INSERT INTO `joke` (`id`, `joke`, `joke_length`, `rank`, `category_id`) VALUES
	(1, 'Dcéra príde za otcom do krčmy a kričí:\r\n- Oci,  oci mamičku odviezla sanitka!\r\nOtec zdvihne hlavu zo stola a pýta sa:\r\n- Biela alebo čierna?', 148, 3.41, 1),
	(2, 'Príde opilec do trafiky a vraví: \r\n- Prosím si jedny bavlnené ponožky.\r\n- Prepáčte, ale my tu predávame iba potreby pre fajčiarov.\r\n- No a? Veď ja som fajčiar!', 170, 3.21, 1),
	(3, 'Zobudí sa chlapík po brutálnej ožranpárty. V hlave včelín a nejdu mu hodinky. Zdvihne telefón a zavolá na presný čas. Počítačový hlas mu hlási:\r\n- Je 11 hodín, 35 minút, 17 sekúnd...\r\n- A mesiac, kurva, mesiac je aký?', 237, 3.57, 1),
	(4, 'Do krčmy príde chlap a povie: \r\n- P-p-pán krr-krrčmár, je-jejednu ddvanástku!\r\n- Je-je-jednu ddvanánástkukuku, ppprosím! - povie krčmár.\r\nVtom vojde ďalší zákazník a objedná si:\r\n- Prosím si jednu desiatku!\r\n- Jednu desiatku prosím - zopakuje krčmár. \r\nTen prvý sa naštve.\r\n- Vyvyvy ssi rorobíte zozo mňa ps-pspsinu?!\r\n- Nananaopak! Zzzz nnennenneho!', 375, 3.53, 1),
	(5, 'Ráno v kúpeľni pred zrkadlom:\r\n- Neviem kto si, ale zuby ti umyjem.', 70, 3.6, 1),
	(6, 'Rozhovor v krčme:\r\n- Počul si, že tento silvester má byť v piatok?\r\n- Hej. Ja len dúfam, že to nebude trinásteho.', 121, 3.25, 1),
	(7, 'Rozhovor v krčme:\r\n- Predám svoju ženu za jednu korunu.\r\nOd druhého stola sa ozve:\r\n- Hej? A koľko bude stáť aktivácia?', 127, 3.1, 1),
	(8, 'Rozrazia sa dvere na krčme a dnu vojde gorila. Oprie sa o pult a objedná si pivo. Popíja, odgrgáva si a nakoniec sa totálne konsternovaný barman odváži a hovorí:\r\n- Viete, v tomto lokáli ešte nikdy žiadna gorila nebola...\r\n- Pri týchto cenách sa ani nečudujem!', 275, 3.41, 1),
	(9, '- Pán hlavný volám vás, haló, pán hlavný.\r\n- A čo si prajete?\r\n- Štyri pivá na účet volaného.', 106, 3.46, 1),
	(10, '- Prosím si pohár čistej vody.\r\n- Čo ti šibe? Toto je slušná krčma, tu minerálku nepodávame.', 102, 3.29, 1),
	(11, 'Ide opitý muž večer po cintoríne , spadne do čerstvo vykopaného hrobu a kričí\r\n- Zimno mi, zimno mi.\r\nPonad hrob prechádza ďalší ožran a odpovedá:\r\n- Bodaj by ci nebulo, kedz si se odhrabal!', 204, 3.39, 1),
	(12, 'Rozhovor v krčme. \r\n- Predstav si akého mám múdreho psa. Keď sa ho spýtam, či idze alebo neidze, predstav si, on idze alebo neidze.', 138, 3.13, 1),
	(13, 'Príde opilec domov, ľahne si vedľa svojej manželky a okamžite zaspí. Na druhý deň sa zobudí, ledva otvorí oči a zamrmle:\r\n- Ach jaj, nechce sa mi vstávať, ale raz treba ísť aj domov.', 197, 3.04, 1),
	(14, 'Novák sa ožral ako sviňa a cestou domov sa plazí po železničnej trati.\r\n- Do riti, dnes sú tie schody, nejaké dlhé! No nič, práve mi ide výťah...', 158, 3.35, 1),
	(15, 'Pri ulievaní vodky:\r\n- Veď som ti hovoril, že nechcem celý pohár, chcem len do polovice.\r\n- Nevadí, odpiješ.', 115, 3.34, 1),
	(16, 'Ide mníška neskoro večer domov a stretne opitého chlapa. Chlap ju zmláti a povie: \r\n"Tak, konečne som ťa, Batman, dostal!"', 129, 3.61, 1),
	(17, 'Traja pri bare. Zrazu sa k jednému z nich priblíži starší ožran a hovorí mu:\r\n"Tvoja matka je najväčšou kurvou v meste!"\r\nTen nič. Žiadna bitka, len mykne plecom a ožran odíde. Po chvíli sa však vráti a opäť dotiera:\r\n"Večer som pretiahol tvoju matku a bolo to super!"\r\nOslovený opäť nič, žiadna bitka, dokonca ani len nadávky. Ožran to vzdá ale vráti sa do tretice:\r\n"Večer mi tvoja matka vyfajčila!"\r\nTo už oslovený nevydrží a zareaguje:\r\n"Choď domov otec, si totálne namol a trepeš hovadiny!"', 533, 3.73, 1),
	(18, 'V Michalovciach otvorili nový pivovar. Poslali vzorku nového piva do Prahy na chuťové zhodnotenie. Za dva týžde im príde rozbor z Prahy s týmto obsahom. \r\n"Vaša kobyla je zdravá". ', 190, 3.35, 1),
	(19, 'Opitý chlap v autobuse.\r\n- Vy, čo sedíte na ľavo, ste najväčší hlupáci na svete. Vy, čo sedíte na pravo, ste najväčší zlodeji na svete.\r\nVtom sa ozve jeden chlapík a vraví. \r\n- Ale pane, ja som v živote nič neukradol.\r\n- Nie? Tak si presadnite na druhú stranu.', 280, 3.47, 1),
	(20, 'Niekedy sa sám seba pýtam, kto sme, odkiaľ sme prišli, kam smerujeme, aký zmysel má vôbec ľudská existencia. Potom si nalejem odpoveď, a zas je dobre...', 162, 3.64, 1),
	(21, 'Syn sa pýta otca:\r\n- Oco, aký je to pocit byť opitý?\r\nOtec vraví: \r\n- Vidíš tých dvoch psov? Keď som opitý, vidím štyroch.\r\n- Oci, ale to je len jeden pes.', 167, 3.64, 1),
	(22, 'Sedia dvaja na cisterne s metylalkoholom a popíjajú.\r\n- Rýchlo si dajme ešte po jednom a pôjdeme. Akosi sa stmieva.', 120, 3.42, 1),
	(23, 'Príde opilec do fotoslužby a hovorí:\r\n- Urobte mi prosím vás skupinovú fotografiu.\r\n- Dobre, postavte sa do polkruhu.', 123, 3.01, 1),
	(24, 'Dvaja opilci stoja na ulici, pozerajú sa na oblohu a hádajú sa koľko tam je mesiacov. Jeden hovorí, že dva a druhý, že tri. Ide okolo tretí a oni sa ho pýtajú, koľko je na oblohe mesiacov. On sa zadíva a po chvíľke sa spýta:\r\n"A v ktorom rade?"', 260, 3.27, 1),
	(25, 'Denník študenta:\r\nPondelok: Mám 50 korún. A mám hlad.\r\nUtorok: Mám 20 korún. A mám naozaj hlad.\r\nStreda: Mám  5 korún. A mám naozaj veľký hlad.\r\nŠtvrtok: Prišli mi peniaze. Išiel som na internát.\r\nPiatok: Nepamätám.\r\nSobota: Nepamätám.\r\nNedeľa: Mám 50 korún. A mám hlad.', 295, 3.69, 1),
	(26, 'Rozhovor v krčme:\r\n- Počúvaj, nevieš, o čom sa rozprávajú ženy medzi sebou, keď sú samé? \r\n- No o tom o čom aj chlapi.\r\n- Hej? Svine!', 145, 3.29, 1),
	(27, 'Tacká sa opitý muž neskoro v noci po sídlisku, a zrazu to zahne k najbližšsiemu domu a začne močiť. Domovníčka sa vykloní a kričí naňho z balkóna:\r\n- Neštite mi tam pod tým balkónom, lebo zíde dole brizolit.\r\nA opilec jej na to:\r\n- ...nech len zide, dostane po papuli!', 288, 3.53, 1),
	(28, 'Hľadám dievčinu, ktorá mi spríjemní večer. \r\nZn. najlepšie barmanku.', 76, 2.65, 1),
	(29, 'Ide opitý muž z krčmy, oprie sa o stenu a začne zvracať. Po chvíli pribehne pes a začne očuchávať zvratky. Opitý muž sa pozrie dolu a vraví:\r\n- To kde som zjedol toho psa?', 184, 3.45, 1),
	(30, 'Príde blondína ku gynekológovi a sťažuje sa. \r\n- Pán doktor mne na ohanbí nerastú vôbec žiadne chĺpky. \r\nDoktor sa zamyslí. \r\n- A koľko máte rokov? \r\n- 26.\r\n- No to by už naozaj rásť mali. A ako často sa milujete? \r\n- No tak 25 až 30 krát týždenne. \r\n- Ale drahá slečna, na dialnici tiež nerastie tráva.', 329, 3.49, 1),
	(31, 'Príde chlapík strašne opitý domov. Keď ho takého zbadá manželka, nazúrená podíde k nemu a strelí mu facku z jednej strany.\r\n- Tak budeš piť?\r\nStrelí mu facku z druhej strany.\r\n- Tak budeš piť?\r\nTresne ho knihou po hlave?\r\n- Budeš piť?\r\nChlapík vyvráti oči a pomedzi zuby pomaly odpovie:\r\n- Tak teda nalej.', 327, 3.56, 1),
	(32, 'Príde alkoholik do krčmy, vytiahne stovku a hovorí: \r\n- Rum za 100 korún.\r\nVypije ho a ožratý leží pred krčmou. Ide okolo jeden teplý a hovorí si: "Tento tu tak leží... dám si jedno kolo".\r\nKeď skončí, strčí mu stovku do vrecka. Ožran sa preberie, siahne do vrecka, nájde stovku a ide si zasa kúpiť rum. Zasa ožratý leží pred krčmou a ide okolo ten teplý a....\r\nKeď sa ožran preberie, ide so stovkou do krčmy a barman na neho kričí: \r\n- Ja viem. Rum za 100 korún.\r\nA ožran mu hovorí:\r\n- Nie, už nechcem rum. Bolí ma z neho zadok.', 568, 3.4, 1),
	(33, 'Stoja dvaja opití v krčme a jeden hovorí druhému:\r\n- Hej, ty, zober mi jedno pivo a ja ti zoberiem cigaretu.', 112, 3.23, 1),
	(34, 'Rozprávajú sa dve kamarátky. Jedna hovorí druhej:\r\n- Môj starý, keď si vypije, okamžite mu to udrie do hlavy. \r\nDruhá na to:\r\n- To je ešte nič. Keď si môj starý vypije, okamžite mu to udrie do pravej ruky. ', 221, 2.84, 1),
	(35, '- V tom pive musia byt ženské hormóny. Vždy, keď ho pijem, hovorím sprostosti a neviem šoférovať.', 106, 3.27, 1),
	(36, 'Príde chlap do drogéria a vraví:\r\n- Prosím vás, máte denaturovaný lieh?\r\n- Nie.\r\n- A nejaké iné kvalitne vínko?', 121, 3.23, 1),
	(37, 'Ide chlapík po ulici a vidí ďalšieho ako zvracia. Príde k nemu, potľapká ho po pleci a hovorí:\r\n- Máte pravdu, čo sa s tým budete srať.', 147, 3.23, 1),
	(38, 'Sedia dvaja opitý oproti sebe na koľajniciach pri tunely. Odrazu prehrmí vlak a odfikne im obe nohy. Keď sa v nemocnici preberú z narkózy, hovorí jeden druhému:\r\n- Na som ti vravel, že tak sova nehúka.', 211, 3.22, 1),
	(39, 'Opitý muž strká kľúč do pouličnej lampy. Okoloidúci policajt si chce z neho vystreliť a hovorí mu:\r\n- Asi nikto nie je doma, čo?\r\nA opilec odpovedá:\r\n- Mňa neoklameš, hore sa svieti.', 196, 3.32, 1),
	(40, 'Príde chlapík s opicou do baru a objedná si vodku. Ked vypije opica začne skákať ako divá, skočí na vedlajší stôl, rozbije poháre, skočí k baru - porozbíja flaše, poháre a všeličo možné a tu zrazu odskočí na biliardový stôl, zbadá biliardovú guľu a zje ju. Všetci sa čudujú ale jej majiteľ hovorí: \r\n"To ona vždy tak vyvádza keď si vypijem - všetku škodu zaplatím". \r\nPrídu znova o týždeň a chlapík si znova objedná vodku. Keď ju vypije, opica znova začne skákať po stoloch, bare, rozbíjať poháre flaše, a tu zrazu priskočí k stolu kde sú na stole čerešne, vezme čerešnu pozrie na ňu a strčí ju najprv do zadku a potom zje. Všetci sa čudujú, že všetko by pochopili len to posledné nie? A  na to majiteľ odpovedá:\r\n"No viete od vdety čo zjedla u Vás biliardovú gulu si radšej všetko odmeria."', 868, 3.56, 1),
	(41, 'Ide ožratý muž domov a pripravuje si reč, čo povie manželke. Vraví si:\r\n- Prídem domov, zazvoním a poviem "Pozri, tvoj miláčik sa opil ako sviňa".\r\nKeď prišiel, zazvonil a vraví žene:\r\n- Vidíš ty sviňa, tvoj miláčik sa zase opil.', 250, 3.2, 1),
	(42, 'Stretnú sa dvaja kamaráti v krčme a jeden druhého sa pýta: \r\n- Čo piješ? \r\n- Všetko, čo sa začína na či.\r\n- A to je čo? \r\n- Či vodku, či rum, či slivovicu.  ', 173, 3.11, 1),
	(43, 'Stretnú sa dvaja známi o polnoci v meste.\r\n- Poďme ešte na pivo, pozýva jeden.\r\n- Nemôžem, idem na prednášku.\r\n- Nevyhováraj sa. O polnoci už predsa prednášky nie sú.\r\n- To teda nepoznáš moju ženu.', 214, 3.29, 1),
	(44, 'Opilec sa vezie domov v autobuse a hovorí vodičovi: \r\n- Keď napočítam do 25, tak sa vyvraciam.\r\n- Kým vy napočítate do 25 už budeme na konečnej. \r\n- 5 krát 5 je 25... blueeaaaa.', 188, 3.38, 1),
	(45, 'Idú dvaja opilci domov a pri vchode povie jeden:\r\n- Tu bývam ja. \r\nDruhý nato: \r\n- Nie, ja tu bývam.\r\nVyvezú sa na piate poschodie a pri dverách povie jeden:\r\n- Tu bývam ja, aha Peter Novák. To som ja.\r\nDruhý vraví: \r\n- Nie, ja som Peter Novák. \r\nOtvoria sa dvere a žena skríkne: \r\n- No, otec a syn a ako prasatá. ', 328, 3.61, 1),
	(46, 'Absolútna definícia:\r\nLekvár je produkt šialenej myšlienky ako neurobiť zo všetkých sliviek slivovicu.', 110, 3.45, 1),
	(47, 'Jeden chlap v Prahe ide domov a na druhý deň príde do krčmý a hovorí: \r\n- Chlapi, včera som išiel domov a pekne po tichu si vyzujem topánky a vyzlečiem, aby som moju ženu nevyrušoval a teraz len počujem: \'Ukončite nástup a výstup, dvere sa zatvárajú.\' A dom mi utečie pred nosom!', 298, 3.14, 1),
	(48, 'Slečna pánovi:\r\n- Pane, vy ste opitý!\r\n- Ja viem. A vy ste strašná škaredá a zajtra ja už nebudem opitý.', 113, 3.3, 1),
	(49, '- Som taky smädný, že by som vypil celé pivo na ex.\r\n- To je nič. Ja som taky smädný, že by som na ex vypil dva deci vody.', 130, 3.16, 1),
	(50, 'V manželstve\r\nMuž príde opitý domov. Žena mu dá facku a pýta sa ho:\r\n"Povedz, budeš ešte piť?"\r\nMuž mlčí. Dostane z druhej strany ďalšiu facku.\r\n"Hovor! Budeš ešte piť?"\r\n"No tak dobre", konečne prehovorí muž. "Nalej!!"', 240, 3.39, 1),
	(51, 'Opitý Jano ide domov a rozmýšľa, čo povie svojej veľmi zlostnej žene a tak si stále opakuje:\r\n- Vidíš miláčik, ožral som sa ako sviňa.\r\nKeď príde domov, otvorí mu žena a Jano zo seba dostane:\r\n- No vidíš, ty sviňa, ako sa tvoj miláčik ožral?', 265, 3.26, 1),
	(52, 'Ležia dvaja beznohí pri koľajniciach a jeden hovorí druhému:\r\n- No vidíš, ja som ti vravel, že to nehúkala sova.', 121, 3.22, 1),
	(53, 'Sranda musí byť, povedal Santa Claus a nerozdal darčeky.', 59, 2.91, 1),
	(54, 'Sedia dvaja kamaráti v krčme. Jeden sa pýta druhého :\r\n- Počúvaj, kedy si mal búračku ? \r\n- Akú búračku ?\r\n- Len mi nehovor, že si sa s takým ksichtom narodil !', 173, 3.37, 1),
	(55, 'Opilec sa vracia zo zábavy a pýta sa kade sa ide na nádražie.Teta mu odpovedá:\r\n"To musíte íst stále rovno."\r\n"Do kelu dnes sa asi na nádražie nedostanem."', 165, 3.26, 1),
	(56, 'Príde opitý muž domov a žena na neho vrieska. \r\n- Ty ožran, všetko prechlasceš! Veď ak by som zomrela, ani ma nebudeš mať za čo pochovať! \r\nMuž na ňu pozrie a povie:\r\n- No teba aby len dačo zožralo!', 214, 3.21, 1),
	(57, 'Príde opitý muž domov a zaklope na dvere.\r\nKeď mu žena otvorí, on ja dá kvety  a žena mu vyčítalo povie:\r\n"Čo si myslíš, že keď mi dáš kvety tak ja hneď roztiahnem mohy?"\r\nMuž sa kukne na ňu a povie:\r\n"A čo my nemáme vázu?"', 246, 3.91, 1),
	(58, 'Vbehne muž do motorestu a skríkne:\r\n"Chlapi, má tu niekdo čierneho psa s bielim obojkom?"\r\nChlapi odpovedia, že nie a muž ktorý tam tak nečakane vtrhne vraví:\r\n"Tak som potom zrazil farára."', 200, 3.24, 1),
	(59, 'Príde opilec do kostola a sadne si do spovedelnice. Farár zmätený, nevie čo má robiť, tak zakašle. Opilec nič, tak mu zaklope na okienko a opilec hovorí:\r\n- Darmo klopeš, ani tu nie je toaleťák.', 207, 3.36, 1),
	(60, 'Rozprávajú sa dve ženy:\r\n- Môj muž stále chlasce a ja už neviem, čo mám na neho použiť, aby prestal.\r\n- Sprav ako ja. Do vane daj víno, hoď tam zdochnutého kocúra a keď sa vráti z práce, tak ho pošli okúpať sa.\r\nŽena tak spravila. Muž sa vrátil z práce, poslala ho okúpať sa. Čaká 10 minút, pol hodiny, hodinu, dve. Už to nevydrží, vletí do kúpeľne a vidí muža vyvaleného v prázdnej vani ako žmýka kocúra a vraví:\r\n- Hik, kocúrik ešte kvapôčku!', 492, 3.28, 1),
	(61, 'Opilci hrajú na kanálovej mreži šachy, keď zrazu jeden vykríkne:\r\n- Do čerta! Niekto nám kradne figúrky!', 113, 3.26, 1),
	(62, 'Príde chlapík do baru a hovorí:\r\n- Pol deci sódy a deci borovičky!\r\nBarman mu naleje a položí pred neho. Chlapík vypije sódu a celú borovičku preleje do pohára od sódy - poldecáku. Barman naňho pozerá a s úžasom hovorí:\r\n- Chlape, vy ste kúzelník?\r\n- Nie. Štátna obchodná inšpekcia.', 307, 3.36, 1),
	(63, 'Chlapík sedí v krčme. Prisadne si ku nemu podnapitý starší pán a hovorí mu:\r\n"Počúvaj, ak mi kúpiš jeden poldecák, ukážem ti hovoriace hodiny." \r\nA tak mu ho kúpi. Takto sa to zopakovalo asi štyri krát. Potom prišli ku nemu domov. Jedna izba s holými stenami, len uprostred izby bola posteľ. Vyberie z pod nej kladivo, a sekne takú do steny, že sa otriasa celý barák. A z druhej strany sa ozve:\r\n"Ty hovädo ožraté, čo tu búchaš o pol štvrtej ráno!"', 481, 3.48, 1),
	(64, 'Viete, kedy je Slovákovi dobre?\r\nKeď sa ožere a je mu zle.', 61, 3.32, 1),
	(65, 'Muž príde domov a žena mu hovorí:\r\n- Povedal si mi, že ideš do krčmy hrať šach a nie piť!\r\n- A čo má byť zo mňa cítiť šachovnicu?', 146, 3.31, 1),
	(66, 'Pýta sa podnapitý chlap v krčme kamaráta:\r\n- Máš auto?\r\n- Nie.\r\n- A aké?', 79, 3.24, 1),
	(67, 'Na rádiu Jerevan:\r\nSlovensko sa podľa najnovších informácií umiestnilo na druhom mieste v pití alkoholu.\r\nŽena sa pozrie na muža a muž vraví\r\n- Čo pozeráš? Robím, čo môžem. ', 191, 3.25, 1),
	(68, 'Manžel ide na oslavu. Žena mu hovorí: \r\n- Pi s mierou!\r\n- Jasné, aj vedro je miera.', 87, 3.28, 1),
	(69, 'Muž sa ráno pozrie do zrkadla a hovorí:\r\n- Nepoznám ťa, ale oholím ťa.', 77, 3.37, 1),
	(70, '- Dežo, čo si taky rozjarený?\r\n- Ale... miesto borovičky som si logol z Jari.', 81, 3.07, 1),
	(71, 'Po  fláme  príde  Baltazár  Osuch  domov. Dlho  stojí,  pozerá  a  potom povie:\r\n- To  je  zasa  hlúpy  program  v  televízii,  že  starká?\r\n- Čo  nevidíš,  ty  ožran  akýsi,  že  stojíš  pred  zrkadlom?', 220, 3.11, 1),
	(72, 'Nové zistenie vedcov: Človek pochádza zo slivky.\r\nDôvod: Zo sliviek je slivovica, zo slivovice opica a z opice človek.', 123, 3.17, 1),
	(73, 'Príde opitý muž domov a žena kričí:\r\n- Včera si bol triezvy a dnes si zasa opitý.\r\n- Vidíš, včera si bola šťastná ty, dnes ja.', 140, 3.14, 1),
	(74, '- Haló, je tam poradňa pre alkoholikov? \r\n- Áno. Aké máte problémy? \r\n- Povedzte mi, čo sa pije k pečenej husi. Biele víno alebo červené?', 148, 3.25, 1),
	(75, 'Dedinčan je na zájazde vo veľkom meste a tak si zájde aj do vinárne. Dá si dve deci vína, na ex ho vypije, položí na pult stokorunáčku a odíde. \r\n- To sú dnes ale hostia - krúti hlavou barman. Prepitné nechajú, ale víno nezaplatia!', 248, 3.36, 1),
	(76, 'Traja opití idú po koľajniciach. Jeden sa ozve:\r\n- Och, ale je tu veľa schodov!\r\nNato druhý:\r\n- Aj zábradlie je dajaké nízke.\r\nPričom ich tretí preruší:\r\n- Chlapi ja už počujem výťah.', 199, 3.57, 1),
	(77, 'Vyrazí jeden Slovák z bodu A do bodu B rýchlosťou 90 km/hod. Vyrazí druhý Slovák z bodu B do bodu A rýchlosťou 120 km/hod. Kde sa stretnú?\n\r\nOdpoveď: V krčme!', 170, 3.23, 1),
	(78, 'Vodiča zastaví policajt:\r\n- Tak pán vodič, fúkajte.\r\n- Nemôžem, som astmatik.\r\n- Prejdite po rovnej čiare.\r\n- Nemôžem, som opitý.', 140, 3.57, 1),
	(80, 'Ide ožratý chlap z reštaurácie a zvracia na každom rohu. Príde k smetiaku a zvracia aj do neho. Vtom z neho vyskočí mačka a upaľuje preč. On sa za ňou obzrie a vzdychne si:\r\n"Bože, kde som toto zožral?!"', 217, 3.39, 1),
	(81, '- Ešte nikdy som nevidel toľko suchých húb ako v nedeľu.\r\n- Nehovor. Ty si bol v lese?\r\n- Nie, ale v krčme došlo pivo.', 125, 3.02, 1),
	(82, 'Boli dvaja. Jeden pil a druhý nepil. Ten, čo nepil, zomrel skôr. Ten, čo pil, ho prešiel autom.', 100, 3.08, 1),
	(83, '- Dedo, mali by ste prestať piť.\r\n- Keď ja už som starý.\r\n- Prestať piť nikdy nie je neskoro.\r\n- Tak potom mám ešte čas.', 130, 3.14, 1),
	(84, 'Príde muž neskoro domov, celý ožratý. Žena sa mu vyhráža:\r\n- No počkaj, veď ty uvidíš.\r\n- No to asi ťažko. Pili sme totiž denaturák.', 148, 3.12, 1),
	(85, 'Novodobé heslo v slovenských krčmách: "Všetky ženy sú krásne, len my málo pijeme."', 91, 3.07, 1),
	(86, 'Viete ako sa delia alkoholici podľa viery?\r\nNa rumokatolikov,\r\nNa liehovistov,\r\nNa pivopičov.', 95, 3.28, 1),
	(87, 'Žena krčí na muža:\r\n- Už zase ideš z krčmy?\r\nMuž:\r\n- A čo chceš, aby som tam sedel večne?', 100, 3, 1),
	(88, 'Žena kričí na muža:\r\n- Len čo sa ťaháš po krčmách, už ťa ani nevidím.\r\n- Ani ja teba. A sťažujem sa?', 115, 3.13, 1),
	(89, 'Krčmár kričí na dedka:\r\n- Hej dedo, máte starú na drôte.\r\n- Telefonuje alebo visí?', 90, 2.96, 1),
	(90, '- Ja si myslím, že ľudia by mali chodiť bosí. Je to oveľa zdravšie. Napríklad ja, keď sa ráno zobudím obutý, tak ma bolí hlava celý deň.', 151, 2.78, 1),
	(91, 'Dvaja v krčme:\r\n- Čau, starý môj, vezmi mi pivo a ja ti vezmem cigu.', 72, 3.09, 1),
	(92, '- Ocko, vodka zdražela. Budeš menel piť!\r\n- Nie synku, ty budeš menej jesť.', 80, 3.23, 1),
	(93, 'Zastaví opitý policajt opitého vodiča.\r\n"Prečo za volantom sedíte traja."\r\n"A to kôli takej hovadine ste ma museli obkľúčiť?!"', 137, 3.6, 1),
	(94, 'Sťažuje sa alkoholik v krčme:\r\n- Predstavte si, príšiel som včera v noci domov a ani vlastné deti ma nepoznali. A keď som sa ráno zobudil, nepoznal som ani ja ich!', 172, 4.15, 1),
	(95, 'Dvaja sa raz strašne dožerú zriedeného paliva do lietadla a ráno volá jeden druhému:\r\n- Ty Fero bolí ťa hlava? \r\n- Héééj. \r\n- Aj mňa, ale skúšal si si prdnúť? \r\n- Niéééééé. \r\n- Tak to ani neskušaj volám ti z Tokia.', 239, 3.38, 1),
	(96, 'Stretnú sa dvaja podgurážený mládenci a začnú konverzáciu:\r\n- Ty chuj!\r\n- Ja že som chuj?! Veď ty ani chuj nie si!\r\n- Ja že nie som chuj?!', 149, 3.32, 1),
	(97, 'Dvaja opilci na námestí:\r\n- Ako to, že mne to tak necvrká?\r\n- Za prvé som od teba starší o rok a za druhé ti štím na kabát.', 134, 3.07, 1),
	(98, 'Opilec si kúpil udenáča a dal si ho do deravého vrecka nohavíc. Keď si šiel uľaviť, vytiahne udenáča, chvíľu naň tupo hľadí a potom mu hovorí:\r\n- Že si malý, to viem. Že smrdíš, to viem tiež. Ale kde si nabral tie smutné oči?', 250, 3.4, 1),
	(99, 'Pred predajňou liehovín leží muž a okoloidúci sa ho pýta:\r\n"Prepáčte, to ste taký opitý, alebo to je reklama?"', 121, 3.14, 1),
	(100, 'Prečo sa neoplatí piť s cudzieho pohára?\r\nLebo by si dostal facku ako hrom!', 79, 2.85, 1),
	(101, 'Vojde do krčmy dvojica a v strede vlečú tretieho, ktorý je už zjavne pod parou. Prídu k baru a zakričia: \r\n- Dve borovičky!\r\nBarman sa ich prekvapene opýta: \r\n- Nie náhodou tri borovičky? \r\n- Nie, ten medzi nami nemôže, on je šofér. ', 248, 3.12, 1),
	(102, 'Slovák v českom bare:\r\n- Dobrý den, pane, přejete si?\r\n- Pohár Whisky!\r\n- Skockou?\r\n- Nie, bez kocky!', 106, 3.33, 1),
	(103, 'Zákazník príde do drogérie a pýta sa: \r\n- Nemáte denaturovaný lieh? \r\nPredavačka odpovedá: \r\n- Nie! \r\nZákazník: \r\n- A nejaké iné fajné vínko?', 156, 3.09, 1),
	(104, 'Opitý muž riadi auto. Zastaví ho opitý policajt a hovorí mu:\r\n- Ako to, že riadite auto dvaja?\r\nOpilec mu odvetí:\r\n- A to ste ma museli kôli takej hlúposti obklúčiť?', 177, 3.2, 1),
	(105, '"Halóó, tu riadiaca veža, ozvite sa!"\r\nKrúžiace lietadlo nič.\r\n"Halóó, tu riadiaca veža, ozvite sa!"\r\n"Hal hik, haló, tu Boeing 000."\r\n"Prestaňte krúžiť a pristaňte!"\r\n"Ale to nejde, hik."\r\n"Dajte mi pilota!"\r\n"Ten, prosím, zalomil na WC."\r\n"Tak potom kopilota!"\r\n"Ten zvacia v kuchyni, hik."\r\n"A navigátor?!"\r\n"Ten, hik, zaspal nad mapami."\r\n"A s kým vlastne hovorím?!"\r\n"Hik, tu je automatický pilot, hik."', 428, 3.13, 1),
	(106, 'Potácajúci muž na ulici si mrmle:\r\n"Už nikdy viac nebudem piť, už nikdy viac, ani menej, toto je tak akurát."', 116, 3.22, 1),
	(107, 'Stojí opitý muž v električke a kníše sa. O chvíľu mu príde zle a vyzvracia sa na ženu sediacu pod ním. Žena vykríkne:\r\n- Vy prasa!\r\n- Ja? Pozri sa na seba, ty sviňa, ako vyzeráš!', 194, 3.11, 1),
	(108, 'Dvoch zlodejov súdia, lebo vykradli obchod s liehovinami.\r\n- Čo ste urobili s takým množstvom alkoholu? - pýta sa sudca jedného.\r\n- Predali sme ho.\r\n- A čo ste urobili s peniazmi?\r\n- Prepili sme ich.', 206, 3.18, 1),
	(109, 'Slovenský bača sa chváli svojim honelníkom:\r\n- Chlapci moji, tá viagra je výborná medicína. Zjedol som len pol tabletky a hneď som vyprášil... ...celú fľašu slivovice!', 181, 2.98, 1),
	(110, '"Pane, vy ste ožratý ako prasa!"\r\n"Áno, ale mňa to do rána prejde, ale vy ste škaredá ako ropucha a vás to neprejde!"', 125, 2.86, 1),
	(111, 'Príde opitý chlap domov s roztrieskaným ksichtom a hneď pri dverách na neho žena kričí:\r\n- Zasa si sa v krčme pobil! Priznaj sa, s kým si si začal?\r\nOn sa však bráni:\r\n- Kdeže, tentoraz som v tom úplne nevinne. Keď som išiel z krčmy, všetko bolo ešte v poriadku. Ale až tu pred našim domom, ako som tak kráčal po chodníku, ten chodník hnusný sa zrazu z ničoho nič prudko zdvihol, že ma tresol po papuli!', 433, 2.99, 1),
	(112, 'Viete prečo opitý chlap, keď príde večer domov, nechá šaty ležať na zemi?\r\nLebo je v nich.', 99, 3.17, 1),
	(113, 'Dvaja opitý idú po koľajniciach.\r\n"Tie schody sú ale nekonečné."\r\n"Ale už nám ide výťah!"', 99, 3.17, 1),
	(114, 'Angličan, Rus a Slovák sa dohadujú, kto má najkvalitnejší alkohol. Angličan vypije fľašu whisky. Dajú pred neho stoličku a pýtajú sa:\r\n- Koľko vidíš stoličiek?\r\nAngličan:\r\n- Ehm... vidím ich dve.\r\nCelkom dobrá whisky. Rus vypije fľašu vodky a tiež sa ho pýtajú koľko vidí stoličiek.\r\nRus:\r\n- Hmm... sú tam štyri.\r\nSlovák vypije fľašu slivovice a tiež sa ho pýtajú koľko vidí stoličiek.\r\nSlovák: \r\n- Hups chlapci, podľa toho v ktorom rade...', 481, 2.91, 1),
	(115, 'Zazvoni chlap u susedov: \r\n- Dobrý deň, minul sa mi doma rum. Tak sa chcem spýtať,či je tá porucha v celom baráku.', 121, 3.2, 1),
	(116, 'Vyhodia opitého chlapa z krčmy na ulicu. Dopadne rovno na kanálovú mriežku. Chytí sa jej a vystrašene skríkne:\r\n- Mňa? A za čo?', 137, 3.33, 1),
	(117, 'Opitý chlap ohmatáva dookola betónový pilier a keď ho už asi tretíkrát obíde, zastane a s nešťastím v hlase zvolá:\r\n- Ježišmária, veď ja som zamurovaný!', 170, 3.47, 1),
	(118, '- Araňa, keď si trochu vypijem, hneď si krajšia!\r\n- Jožo, ty debil, veď to som ja, tvoj brat Fero!', 104, 3.41, 1),
	(119, 'Opilec zazvoní na dvere. Otvorí mu staršia pani. Opilec sa spýta:\r\n- Môžem si u vás nechať dva litre vodky a tri litre vína? \r\n- Môžete.\r\n- Bueeeeee.\n', 161, 2.8, 1),
	(120, '- Počúvaj, odkiaľ máš frajerku?\r\n- Z Orkucian.\r\n- A priamo?', 64, 3.16, 1),
	(121, 'Príde ožratý muž pred svoje dvere a v náručí drží cudziu ženu. Jeho manželka otvorí dvere a vyčítavo sa pozrie na svojho muža. Ten jej hovorí:\r\n- Stará, nebuď sviňa. Povedz, že si ségra.', 207, 3.37, 1),
	(122, 'Slovák sedí na brehu potoka a chytá ryby. Po dosť dlhej dobe konečne jednu chytí a hneď zlatú.\r\n"Ak ma pustíš splním ti tri želania!"\r\nSlovák ju teda pustí. Po chvíli sa rybka vynorí a čaká. Slovák sa zamyslí, ale neverí, a tak skusmo:\r\n"Chcem flašku borovičky!"\r\nZahrmia hromy blesky a objavi sa fľaša borovičky.\r\n"Hmm. Dobra!", \r\ns údivom povie slovák a zahodí prázdnu fľašu.\r\n"Chcem aby v tomto potoku tiekla borovička!"\r\nHromy blesky, ochutná a fakt borovička. Načiera plné hrste a v tom ho rybka preruší:\r\n"A tvoje tretie želanie?"\r\n"Nalej ešte poldeci!"', 600, 3.31, 1),
	(123, 'Stretnú sa dvaja ožratí mládenci a začnú konverzáciu:\r\n- Ty chuj!\r\n- Ja že som chuj?!\r\n- Veď ty ani chuj nie si!\r\n- Ja že nie som chuj?!', 146, 3.03, 1),
	(124, 'Totálne ožratý chlapík vyjde z krčmy, urobí dva kroky a spadne do mláky. Ihneď sa postaví, odpľuje si a hovorí:\r\n– Poondiaty mikrospánok.', 151, 3.46, 1),
	(125, 'Heslo dňa: \r\nFajčiť síce budem, ale piť neprestanem!', 57, 3.7, 1),
	(126, 'Príde opitý chlapík o druhej v noci na sídlisko a kričí:\r\n"Ľudia"\r\nRozsvieti sa zopár okien. V tom chlapík zakričí druhý krát:\r\n"Ľudia"\r\nRozsvieti sa polovica sídliska, ale to chlapíkovi nestačí a tak zakričí tretí krát:\r\n"Ľudia"\r\nV tú chvíľu sú už všetci hore, pozerajú sa von oknom, že čo je to za magora čo kričí o druhej ráno na sídlisku a chlapík zakričí posledný krát:\r\n"Čo nespíte."', 433, 3.27, 1),
	(127, 'Na prednáške o škodlivosti alkoholu:\r\n"Je známych veľa prípadov, keď od muža-alkoholika odíde žena."\r\nHlas zo sálu:\r\n"Prosím vás, a koľko na to treba vypiť?"', 172, 3.02, 1),
	(128, 'Muž príde domov ožratý jak činka, postaví sa do stredu obývačky a len tak stojí. Po štvrť hodine to už žena nevydrží a hovorí:\r\n"Čo tam stojíš, veď si sadni!"\r\n"Veď hej, hneď, len čo okolo poletí kreslo!"', 228, 3.01, 1),
	(129, '"Prosím vás, tá vodka, čo som včera u vás kupoval, bola čerstvá?"\r\n"Áno, samozrejme!"\r\n"Ale mne z nej bolo trochu tažko od žalúdka, keď som vypil 2 fľašky."', 171, 3.2, 1),
	(130, 'Opitý nastúpi do plnej električky a kričí:\r\n"Heeej! Ľudia! Je tu niekto?"\r\nHrobove ticho, nikto sa neozýva.\r\n"Nikto? Tak sa tu môžem vychcať."', 152, 3.39, 1),
	(131, 'Ide ožran domov a na rohu strká klúče do pouličnej lampy. Ide okolo neho policajt a pýta sa :\r\n- Občan, čo to tu stvárate?\r\n- Pokúšam sa dostať domov...\r\n- A čo nejde?\r\n- No nie...\r\n- Hmmmm, tak skúste zakričať, hore sa ešte svieti.', 249, 3.43, 1),
	(132, 'Rozprávajú sa dvaja kamaráti v krčme:                         \r\n- Videl si už bieleho slona?                                   \r\n- Nie, ja až tak veľa nepijem.', 166, 3.54, 1),
	(133, 'Hrajú dvaja opilci šach na kanálovej mriežke. Po chvíli jeden hovorí:\r\n- Boha mu, kto nám furt berie figúrky?', 117, 2.88, 1),
	(134, 'Na súťaži v pití alkoholu hovorí komentátor:\r\n"Do arény vstupuje americký reprezentant. Bude piť zo štamprlíkov." Vypije prvý štamprlík, druhý, tretí. A už je hotový! Kým odnášajú amerického reprezentanta, ruský borec sa v blízkom bare rozcvičuje pohárom vína.\r\n"A už nám nastupuje japonský reprezentant! Bude piť z poldecákov." Pije prvý poldecák, druhý, tretí. A uz je hotový aj japonský reprezentant! Kým odnašajú japonského reprezentanta, posiľuje sa ruský v blízkom bare pohárom vína.\r\n"Konečne nastúpil aj ruský borec. Bude piť z horčičákov."\r\nPije prvý horčičák,druhý, tretí. A už je hotový horčičák! Kým prinášajú nový horčičák, ruský reprezentant sa v blízkom bare rozcvičuje pohárom vína.', 777, 3.19, 1),
	(135, 'Opitý chlap zastaví okoloidúceho chodca:\r\n- Prosím vás, hik, koľko hrčí, hik, mám na čele?\r\n- Tri.\r\n- Výborne, hik. Ešte dva stĺpy a som doma. ', 156, 3.34, 1),
	(136, 'Správy:\r\nTeroristi, ktorí pred týždňom obsadili vínnu pivnicu v Pavlovciach, ešte stále nemôžu sformulovať svoje požiadavky.', 136, 3.56, 1),
	(137, 'Dvaja muži mali strašnú chuť sa ožrať, avšak dokopy mali iba dvadsať korún. Jeden z nich zrazu dostal dobrý nápad. Kúpil hot-dog v najbližšom stánku, odhodil rožok a hovorí tomu druhému:\r\n"Počuj, musíme ísť na to psychologicky. Ja si strčím párok do nohavíc, ideme do baru, dáme si po veľkom koňaku a keď bude treba platiť, ja rozopnem rázporok, ty sa zohneš a zacneš cmúľať tento párok. Krčmár bude znechutený a vyhodí nás aj bez platenia."\r\nStalo. Plán funguje ostošesť, ale potom, čo ich vyhodia už asi zo šiesteho baru ten druhý hovorí:\r\n"Počuj, mňa už to nejak nebaví. Mám celkom modré kolená čo furt padám na dlážku k tvojmu párku."\r\n"Ty máš problém? Ja som stratil párok už v druhom bare..."', 766, 4.06, 1),
	(138, 'Idú dva opité hady po ceste. Jeden sa pýta toho druhého:\r\n- Sme mi jedovaté hady?\r\n- Pravdaže a prečo sa pýtaš?\r\n- Prepáč, ale zahryzol som si do jazyka.', 164, 2.96, 1),
	(139, 'Zastaví pán taxíka a při dohadování, kam chce odvézt, se zeptá, zda si může na zadní sedadlo odložit plato chlebíčků a dvě láhve vína. Taxíkář samozřejmě souhlasí. \r\n"Bleeeeeeeee..."', 206, 3.21, 1),
	(140, '"Kde sa tu vzalo toľko prázdnych fliaš?"\r\n"Ako to mám vedieť? V živote som prázdnu fľašu nekúpil!"', 108, 3.04, 1),
	(141, 'Stojí opilec na rohu a vykrikuje:\r\n"Taxi!!! Taxi!!! Taxi!!!"\r\nNačo prejdú okolo asi tri taxíky a ani jeden nezastaví...\r\nOpilec zvesí hlavu a mumle:\r\n"Taxi!!! Taxi!!! Tak si radšej vyhoním..."', 200, 3.23, 1),
	(142, 'Príde ožratý chlapík do predajne lahôdok.\r\n- Prosím vás... hik... máte okenu?\r\n- Nie.\r\n- A to si hovoríte lahôdky?', 124, 3.29, 1),
	(143, 'V ZOO stojí pri klietke s vlkom jeden človek opitý na mol a hádže do neho všetko, čo má po ruke. Strážnik ZOO príde ku nemu a pýta sa ho:\r\n- Pane, čo to robíte? Čo vám ten vlk urobil?\r\n- Mne? Mne nič, ale táto sviňa zožrala karkulku.', 253, 3.15, 1),
	(144, 'Denník Američana:\r\nPondelok: Pijem s východniarmi.\r\nUtorok: Skoro som umrel.\r\nStreda: Pijem s východniarmi.\r\nŠtvrtok: Ľutujem, že som v utorok neumrel.', 158, 3.48, 1),
	(145, 'Príde opilec do krčmy a hovorí: \r\n- Chcem dva CD-Rumy a Interfernet.', 71, 3.11, 1),
	(146, 'Opitý východniar víjde v Prahe z krčmy, kde ho stretne černoška a hovorí. \r\n- Hele, kluku, nechtel bys jít semnou domú?\r\n- A čo by som asi tak robil v Afrike.', 168, 3.14, 1),
	(147, 'Stretnú sa dvaja opitý na ulici. Jeden sa zahľadí kalným zrakom na toho druhého a hovorí:\r\n"Prosím vás, môžem pomedzi vás prejsť?"\r\n"Áno môžete, ale po jednom!"', 176, 3.24, 1),
	(148, 'Stojí ožran v elektrické, drží sa za tyč a kníše sa. Naraz mu príde zle a vyzvracia sa žene sediacej pod ním na šaty. Tá skríkne:\r\n- Vy prasa!\r\nNa to ožran:\r\n- Ja? Na seba sa pozri ty sviňa, ako vyzeráš!', 221, 3.23, 1),
	(149, 'V mrakodrape je bar. Jeden chlapík prišiel do baru a prosí si pivo a sódu. Glgne pivo, glgne sódu a skočí z mrakodrapu. O päť minút sa vráti a prosí si pivo a sódu. Glgne pivo, glgne sódu a skočí. Tak sa to zopakuje niekoľko krát. Potom príde k nemu jeden chlapík a pýta sa ho ako to robí.\r\n- Glgnem pivo, glgnem sódu a skočím.\r\nChlap glgol pivo a sódu, a skočil. Zabil sa. Barman vraví.\r\n- Ty si ale sviňa SUPERMAN, keď si ožratý!', 463, 3.14, 1),
	(150, 'Do krčmy vbehne chlapík, ktorý už má trochu vypité a zreve na krčmára: \r\n- Dva rumy a dve borovičky, kým to nepríde!  \r\nKrčmár mu v momente naleje, chlapík to hodí do seba a opäť zreve: \r\n- Dva rumy a dve borovičky, kým to nepríde!  \r\nKeď mu to krčmár leje asi po desiaty krát pýta sa ho: \r\n- A máte vy to vôbec ako zaplatiť? \r\nChlapík buchne po stole: \r\n- A už je to tu!', 401, 3.4, 1),
	(151, 'Do krčmy príde pán, objedná si dve veľké vodky, jednu vypije, druhú si vyleje do vrecka na košeli. Objedná ďalšie dve, jednu vypije, druhú vyleje do vrecka na košeli. Krčmár sa pýta, či mu trochu nešibe a pán na neho zreve:\r\n- T-t-y mi mmôžeš tak akurát ob-oblízať riť!\r\nA z vrecka na košeli sa vynorí biela myška a dodá:\r\n- Aaaj s tým ttvojim kocúrom!', 384, 3.08, 1),
	(152, 'V ZOO stojí opitý chlap pred klietkou s vlkmi. Do jedného vlka hádže všetko, čo má po ruke. Vtom príde strážnik a pýta sa ho čo to robí a čo mu ten vlk urobil.  Chlapík sa otočí na strážnika:\r\n- Mne nič, ale zjedol Karkulku!', 245, 2.88, 1),
	(153, 'Ožran nastúpi do električky, drží sa tyče, kníše sa a mútnym pohľadom pozerá po ľuďoch.\r\n- Všetky ženy na ľavej strane sú kurvy! Všetky ženy na pravej strane sú hlúpe husi! - zakričí na plnú električku\r\n- No dovoľte! - ohlási sa jedna zo žien - Aká som ja kurva?\r\n- No dobre, tak prejdi na pravú stranu...', 335, 3.08, 1),
	(154, '- Nechápem, prečo ma priviedli na políciu? - sťažuje sa muž so silnou "opicou"\r\n- To kvôli alkoholu, - spresňuje službokonajúci seržant.\r\n- Heej? No super! Dajte mi dva deci koňaku.', 193, 3.17, 1),
	(155, '- Predpokladám, že máš naozaj silný motív, keď sa odvážiš prísť domov ráno o šiestej totálne ožratý - kričí nervózna žena na svojho muža\r\n- Pravdaže mám. Raňajky.', 187, 3.16, 1),
	(156, '- Som veľmi znepokojený. Moja stará začala chodiť po krčmách.\r\n- A sakra!... A pije veľa?\r\n- Čo by pila... Hľadá mňa.', 129, 2.9, 1),
	(157, 'Vracia sa úplne opitý chlapík domov, vyberie kľúče a odomyká byt.\r\nZrazu vybehne majiteľ bytu a hovorí: \r\n"Sused, prosím vás, veď vy bývate o poschodie vyššie." \r\nChlapík sa pomotá po dome a znovu stojí pri tých istých dverách. Znova vybehne sused a vysvetľuje mu, že býva o poschodie vyššie... \r\nNa tretí krát sa už napitý chlapík nezdrží: \r\n"No, hlavne, že ty bývaš všade!"', 412, 3.53, 1),
	(158, 'Opitý muž nastúpi do taxíka a začne sa vyzliekať. Vodič mu povie:\r\n- Hej, hej, toto je taxi a nie hotel.\r\nOpilec odvetí:\r\n- Taxi? Prečo si to nepovedal skôr. Práve som si vyložil topánky pred dvere.', 211, 3.06, 1),
	(159, 'Na železničnej stanici nastúpi totálne ožratý chlap do taxíka a vraví šoférovi:\r\n- Odvezte ma, prosím, na železničnú stanicu.\r\nTaxikár sa otočí dozadu a povie:\r\n- Nech sa páči, ráčte si vystúpiť, sme na mieste.\r\nOpilec sa k nemu nakloní so slovami:\r\n- Vďaka! Tu máte kilo a nabudúce nejazdite tak rýchlo.', 332, 3.31, 1),
	(160, 'Opitý v krčme sa chce postaviť, ale hneď padne na nos. Postavý sa a objedná si vodku. Keď ju vypije, tak to skúsi znova, ale zase spadne. Tak sa to opakuje 3x. Tak sa si objedná kávu, že keď to nepomôze, že sa domov doplazi. Ale nič.\r\nDoplazí sa teda potichu domov.\r\nRáno žena:\r\n"Ty si bol včera dobre sťatý!"\r\n"Ako to vieš? Veď som prišiel potichu."\r\n"Krčmárka ti ráno doviezla tvoj invalidný vozík."', 430, 3.34, 1),
	(161, 'O druhej po polnoci zastavia policajti opitého muža.\r\n- Občan, čo sa tu potulujete tak neskoro v noci?\r\n- Ja, ja idem na prednášku.\r\n- Kto prosím vás prednáša o druhej v noci?\r\n- Kto? Predsa moja žena!', 212, 3.15, 1),
	(162, 'Príde podnapitý otec domov, sadne si na gauč a hlasno si uprdne. Na to syn vstane, zareaguje\r\na odíde:\r\n- Fúúj, otec!\r\nA otec na to:\r\n- No krásne ako je tá dnešná mládež vychovaná. Ssyn odíde, lebo nemôže vlastného otca ani cítiť.', 249, 2.91, 1),
	(163, 'Vojde chlapík do krčmy a objedná si desať vodiek. Vypije ich jednu za druhou, strasie sa a dopraje si polhodinovú pauzu. Po polhodine si objedná ďalších deväť poldecákov, po ďalšej polhodine osem, potom sedem a takto to ide, až kým si po niekoľkých hodinách neobjedná už iba jeden. Pozrie sa naň a po krátkom zaváhaní ho vypije ako všetky predošlé. Hneď nato padne ako sťatý. A keď sa o niekoľko minút neskôr preberie, s námahou vstane a sucho skonštatuje: \r\n- Kua, čím menej pijem, tým som viac opitý.', 543, 3.1, 1),
	(164, 'Dvaja opilci sa stavia, že po silvestri už nebudú piť. Jeden povie:\r\n- A o čo sa tada stavíme?\r\nA druhý:\r\n- O dva litre vodky.', 133, 2.89, 1),
	(165, 'Muž sa vrúti do krčmy a volá na krčmára: \r\n- Rýchlo jedno pivo, než to príde! \r\nKrčmár okamžite pokladá preď neho pivo. Chlapík pivo vrhne do seba a zvolá: \r\n- Rýchlo ďalšie, než to príde. \r\nKeď tak už vypije piate pivo, krčmár sa ho pýta: \r\n- A čo platenie? Máte vôbec peniaze? \r\nA on: \r\n- Do riti, už to prišlo!', 344, 2.92, 1),
	(166, 'Pýta sa opitý robotník v krčme druhého: \r\n- Nevieš koľko je hodín ?\r\n- Viem.\r\n- Díki.', 94, 3.14, 1),
	(167, 'Chlap vraví v krčme:\r\n- Včera idem domov, pozerám a vonku moja stará. Vypúlené oči, smrdí, vrieska na mňa... Pozriem sa bližšie a to TRAKTOR.', 153, 3.34, 1),
	(168, 'Aký je rozdiel medzi alkoholikom a folklóristom?\r\nAlkoholik sa dá  ešte vyliečiť.', 87, 3.3, 1),
	(169, 'Ide veľmi podnapitý muž domov. Cestou sa mu spraví nevoľno, nuž sa vyzvracia do kontajnera na smeti. Zrazu odtiaľ vyskočí mačka. Opitý muž sa poškrabe na hlave a začudovane vraví:\r\n- A teba som kedy zjedol?', 221, 3.23, 1),
	(170, 'Muž sa vráti veľmi opitý z krčmy. Žena mu vyčíta:\r\n- Zase si bol na pive! Mám to po krk! Rozhodni sa - alebo ja, alebo pivo!\r\nPo chvíli rozmýšlania ten povie:\r\n- Aaa...koľko piva?', 192, 3.3, 1),
	(171, 'Príde opitý do reštaurácie a objedná si koláč z čerešňou, ktorá bude na vrchu. Koláč už zjedol a ostala mu čerešňa. Opitý sa snaží napichnúť čerešňu na vydličku, ale čerešňa mu odskočí na zem. Hodinu sa trápi chytiť tú čerešňu, ale stále mu to odskakuje. Po chvíli príde čašník a napichne mu čerešňu na vydličku. Opitý mu povie:\r\n- Sa ti machruje, keď som ti ju uštval.', 419, 3.12, 1),
	(172, 'Pred školou stojí muž s veľkým bruchom. Z okna sa vykloní mladá učiteľka a pýta sa:\r\n- Čakáte dieťa?\r\nA muž na to:\r\n- Nie, to je od piva!', 151, 3.11, 1),
	(173, 'Príde dobre alkoholom podgurážený človek k policajtovi a hovorí:\r\n- Počúvaj. kde je druhá strana ulice?\r\n- Tam.\r\nOžran mu odpovedá: \r\n- Tam som bol a povedali mi, že tu.', 181, 3.13, 1),
	(174, 'Poznáte slovenský päťboj?\r\n1. Šprint do krčmy\r\n2. Slovenská hádzaná\r\n3. Hod tyčkou\r\n4. Prekážkový beh domov\r\n5. Zápasenie s opicou.', 145, 3.44, 1),
	(175, 'Opilec v krčme sleduje hodnú chvíľu dvojičky. Po čase príde jedno dvojča za opilcom a vraví:\r\n- Nebojte sa, ujo, nevidíte dvojmo, my sme naozaj dvojičky!\r\n- Všetci štyria?', 184, 2.99, 1),
	(176, 'Jeden kamarát vidí druhého, nesmierne vysmiateho a šťastného. Tak sa ho pýta.\r\n- Tak čo? Ako sa volá to šťastné dievča?\r\n- Johny - vraví s pôžitkom.\r\n- Čo? Ty si buzerant?\r\n- Johny Walker - dodáva druhý.', 222, 3.07, 1),
	(177, 'Príde asi 40-ročný chlapík do krčmy a hovorí kamarátom sediacim okolo stola:\r\n- Išiel som po ulici a šiesti oproti mne. Všetkých som pobil a tomu šiestemu som takú zabil, že mu  šlabikár z tašky vypadol. ', 221, 3.34, 1),
	(178, 'Na námestí zatvára pracovník slovenských vodárni taky ten veľký zo zeme trčiaci kohútik na vodu. Točí s ním a točí a točí. Pozerá sa na neho jeden ožran, príde k nemu, poklepe ho po pleci a hovorí mu :\r\n- Ešte raz otočíš tým námestím, tak ti jednu vrazím!', 284, 3.31, 1),
	(179, 'Nad alkoholom sa ešte nikomu v živote nepodarilo zvíťaziť.\r\nChlapom z Terchovej sa podarilo remizovať.', 108, 3.12, 1),
	(180, 'Opitý muž potrebuje na WC a tak to oprie o najbližší múr. Staršia pani ide okolo a hovorí:\r\n- Och, aká hrubosť!\r\nOn na to:\r\n- A dĺžku ste si všimli?              ', 175, 4.03, 1),
	(181, 'Kričí hosť na čašníka:\r\n- Prosím vás, mám v pive muchu!\r\n- To musíte robiť taký rozruch kvoli jednej muche? Veď ona vám toho piva vela nevypije!              ', 172, 3.18, 1),
	(182, 'Pýta sa opitý robotník v krčme druhého:\r\n"Prosím ťa, nevieš koľko je hodín?"\r\n"Viem."\r\n"Dík."              ', 118, 4, 1),
	(183, '"Ďuro, poď si ku mne vypiť!"\r\n"Máš sviatok?"\r\n"Nie, borovičku."              ', 83, 3.82, 1),
	(184, 'Ide opitý muž z krčmy, oprie sa o stenu a začne zvracať. Po chvíli pribehne pes a začne očuchávať zvratky. Opitý muž sa pozrie dolu a vraví:\r\n"To kde som zjedol toho psa?"              ', 198, 3.65, 1),
	(185, 'Príde chlapík strašne opitý domov. Keď ho takého zbadá manželka, nazúrená podíde k nemu a strelí mu facku z jednej strany.\r\n"Tak budeš piť?"\r\nStrelí mu facku z druhej strany.\r\n"Tak budeš piť?"\r\nTresne ho knihou po hlave?\r\n"Budeš piť?"\r\nChlapík vyvráti oči a pomedzi zuby pomaly odpovie:\r\n"Tak teda nalej."              ', 341, 3.65, 1),
	(186, 'Totálne ožratý chlapík vyjde z krčmy, urobí dva kroky a spadne do mláky. Ihneď sa postaví, odpľuje si a hovorí:\r\n"Poondiaty mikrospánok."              ', 163, 3.67, 1),
	(187, 'Príde opilec do fotoslužby a hovorí:\r\n"Urobte mi prosím vás skupinovú fotografiu."\r\n"Dobre, postavte sa do polkruhu."              ', 137, 3.4, 1),
	(188, 'Syn sa pýta otca:\r\n"Oco, aký je to pocit byť opitý?"\r\nOtec vraví:\r\n"Vidíš tých dvoch psov? Keď som opitý, vidím štyroch."\r\n"Oci, ale to je len jeden pes."              ', 180, 4.11, 1),
	(189, 'Príde opitý muž domov a žena kričí:\r\n"Včera si bol triezvy a dnes si zasa opitý."\r\n"Vidíš, včera si bola šťastná ty,\r\ndnes ja."              ', 155, 3.83, 1),
	(190, 'Ide ožran z krčmy cez cintorín a spadne do novovykopaného hrobu a začne kričať: "Je mi zimá! Je mi zimá!" Ide okolo druhý ožran, chvíľu sa zastaví a vraví: "Bodaj by ti nebola, keď si sa odkryl!"              ', 225, 3.17, 1),
	(191, '"Pán hlavný, ten rezeň, ktorý ste mi priniesli, akosi páchne slivovicou!"\r\nHlavný odstúpi o dva kroky dozadu a pýta sa: "Aj teraz?"              ', 153, 3.79, 1),
	(192, 'Pýta sa okoloidúci pán opilca, ktorý práve vyšiel z baru:\r\n"Čo vás tak núti opíjať sa?"\r\n"Nič" hovorí opýtaný, "ja som dobrovoľník!"              ', 163, 4, 1),
	(193, 'Nápis na jednej modranskej vinárni:\r\n"Nenechávajte sa okrádať inde, poďte k nám!"              ', 102, 3.33, 1),
	(194, 'Chlapík príde neskoro v noci domov, zvalí sa na posteľ a hovorí svojej manželke:\r\n"Prepáč, miláčik, ale stavili sme sa s kamarátmi v šenku, kto vypije viacej pohárikov."\r\n"Áno? A kto skončil na druhom mieste?"              ', 238, 3.14, 1),
	(195, 'Manželka hovorí manželovi:\r\n"Vyber si, buď ja alebo alkohol!"\r\n"A koľko by bolo toho alkoholu?"              ', 114, 3.17, 1),
	(196, 'Pýta sa čašník zákazníka:\r\n"Prajete si pivo alebo rum?"\r\n"Áno."              ', 84, 3.53, 1),
	(197, 'Rozčuľuje sa Jožo v krčme:\r\n"Nemám rád vulgárne výrazy, ako napríklad narážky, že som notorik!"\r\n"A nie si?"\r\n"No, oveľa lepšie mi pripadá, keď o mne hovoria, že som majster vo svojom obore."              ', 222, 3.55, 1),
	(198, '"Pán doktor, nemôžem piť."\r\n"Dajte sem, ja vypijem!"              ', 70, 3.74, 1),
	(199, 'Pani učiteľka dala žiakom na domácu úlohu aby sa rodičov spýtali čo im doma chyba. V škole: \r\n- no Janko čo vám chyba doma?\r\n- mikrovlnka.\r\n- A čo u vás nieje Peťka? \r\n- pračka \r\n- A čo vám chyba Ferko?\r\n- Nič. \r\n- Ako je to možné ?\r\n- No, môj oco včera prišiel ožratý domov vyrihal sa do skrine a mama povedala:\r\n- Už len toto nám chýbalo!              ', 382, 3.45, 1),
	(200, 'Opitý muž sa pýta taxikára:\r\n- Zmestí sa vám sem jedno kura?\r\n- Samozrejme, miesta je tu dosť.\r\n- Bueeeeee...              ', 130, 2.74, 1),
	(201, 'Alkoholik povedal:\r\n- Ak sa zajtra neuvidíme, nahmatáme sa na očnom!              ', 85, 3.4, 1),
	(202, '- Dežo, kto ťa núti piť?\r\n- Nikto, ja som dobrovoľník.              ', 74, 3.42, 1),
	(203, 'Rozprávajú sa dvaja chlapi v krčme: \r\n- Ako ten týždeň letí. Človek nestihne ani vytriezvieť a už je tu zase piatok...              ', 142, 3.8, 1),
	(204, 'Pýta sa opitý robotník v krčme druhého:\r\n- Prosím ťa, nevieš koľko je hodín?\r\n- Viem.\r\n- Dík.              ', 118, 3.87, 1),
	(205, 'Manžel se vracia z krčmy a nemôže sa trafiť do dverí. Manželka sa ide po piatich minútach pozrieť, čo mláti do dverí, zbadá\r\nmanžela a hovorí:\r\n- Ty máš ale opicu!\r\nA manžel odpovie:\r\n- Som rád, že si sebakritická...              ', 251, 4, 1),
	(206, 'Príde zákazník do baru a objedná si:\r\n- 3x vodku a deci sódy.\r\nBarman ho obslúži, chlapík vypije sódu a tie tri poldecáky všetky naleje do toho decového pohára. Barman s údivom hovorí:\r\n- Jeeej, vy ste kúzelník?\r\nZákazník vyťahuje preukaz:\r\n- Nie, Slovenská Obchodná Inšpekcia...              ', 316, 3.93, 1),
	(207, 'Sudca dosť červený v tvári zahájil jednanie po dlhom obede. Prvým prípadom bol muž obvinený z jazdy v opitom stave, ktorý sa hájil tým, že to proste nie je pravda: \r\n- Som taký triezvy ako vy, vaša ctihodnosť. \r\nSudca okamžite rozhodol:\r\n- Zapisovateľ zaznamená, že obvinený sa priznal. Odsudzujem ho na 30 dní.              ', 347, 3.7, 1),
	(208, '"Jano, hádaj, čo mám vo vrecku? Začína to na P."\r\n"Peniaze?"\r\n"Nie, pollitrovku! A hádaj, čo mám \r\nv druhom vrecku? Začína to na E."\r\n"Deži, to naozaj neviem!"\r\n"Ešte jednu!"              ', 200, 3.63, 1),
	(209, 'Policajt zastaví podnapitého vodiča a pýta sa ho: \r\n"Ste ochotný podrobiť sa skúške na alkohol?"\r\n"Jasné, a v ktorej krčme?"              ', 148, 4, 1),
	(210, 'Vojde do krčmy dvojica a v strede vlečú tretieho, ktorý je už zjavne pod parou. Prídu k baru a zakričia: \r\n"Dve borovičky!"\r\nBarman sa ich prekvapene opýta: \r\n"Nie náhodou tri borovičky?"\r\n"Nie, ten medzi nami nemôže, on je šofér."              ', 260, 4, 1),
	(211, 'Na plagáte sa objavilo:\r\n"Alkohol je nepriateľ!" \r\nV noci k tomu ktosi pripísal: \r\n"Len zbabelec uteká pred nepriateľom!"              ', 140, 3.82, 1),
	(212, 'Plazia sa dvaja opilci po koľajniciach a jeden vraví:\r\n"To je schodov, čo?"\r\nA druhý na to:\r\n"Čože schodov, ale zábradlie je prekliato nízko."\n', 151, 3.61, 1),
	(213, 'Traja pri bare. Zrazu sa \r\nk jednému z nich priblíži starší ožran a hovorí mu: \r\n„Tvoja matka je najväčšou šľapkou v meste!" \r\nTen nič. Žiadna bitka, len mykne plecom a ožran odíde. Po chvíli sa však vráti a opäť dotiera: „Večer som pretiahol tvoju matku a bolo to super!" \r\nOslovený opäť nič, žiadna bitka, dokonca ani len nadávky. Ožran to vzdá, ale vráti sa do tretice: „Večer mi tvoja matka vyfajčila!" \r\nTo už oslovený nevydrží \r\na zareaguje: \r\n"Choď domov otec, si totálne namol a trepeš hovädiny!"              ', 565, 4.13, 1),
	(214, 'Trápiť sa s rumom a borovičkou?\r\nBrať si so sebou dve fľaštičky?\r\nJa teda nie!\r\nJa sa chcem len ožrať a ísť.\r\nA preto používam "Chlast and Go" - tuzemský rum a slovenskú\r\nborovičku v jednom - RUMOVIČKA !!!              ', 236, 3.78, 1),
	(215, 'Viete, čo je to maximálna opilosť?\r\nKeď už nemôžete bez cudzej pomoci ležať na zemi.              ', 107, 3.14, 1),
	(216, 'Pred predajňou liehovín leží muž a okoloidúci sa ho pýta: \n"Prepáčte, to ste taký opitý, alebo to je reklama?"\n', 122, 3, 1),
	(217, 'Hovorí ožratý ekonóm:\n"Ešte jedno deci investícií a je zo mňa nehnuteľnosť..."\n', 89, 3.43, 1),
	(218, 'Hovorí jeden alkoholik druhému: \n"Nerád pijem v prítomnosti manželky. Ten pohľad, ako sa z nej stanú dve... to je jednoducho niečo strašné..."              ', 166, 3.75, 1),
	(219, '"Čo dnes pijeme?"\n"Suché šampanské..."\n"Tak nasyp aj mne!"\nVyhodia opilca z krčmy na ulicu a dopadne rovno na pouličný kanál, ktorý je zakrytý mriežkou. Chytí sa tej mriežky a zakričí: \n"Mňa a začoó?"              ', 232, 3.09, 1),
	(220, 'Policajt hovorí:\n- Ako ste mohli sadnúť za volant tak opitý.\n- Ťažko veľmi ťažko ale kamaráti mi pomohli.\n', 116, 2.8, 1),
	(221, '- Oco, ja už sestričku neunesiem.\nNes ju ty, ja ponesiem fľašu.\n- Nemáš rozum? A čo keby ti spadla?              ', 120, 3.47, 1),
	(222, 'Stavia sa maďar,rus a slovák kto uvidi viac stoličiek pred sebou po vypiti 1 litru domáceho alkoholu.\nPrvý ide maďar.Vypije 1l domacej vodky a pytaju sa ho kolko vidi stoličiek pred sebou:"No 3".\nDruhy ide rus,ten si da liter Puskina a pytaju sa ho kolko vidi stoličiek:"No 5"\n.Treti ide slovak,ten si da slivovicu a pytaju sa ho kolko stoličiek vidi,on odpoveda:"A v ktorom rade?".              ', 405, 3.67, 1),
	(223, '"Prečo piješ to pivo so slamkou?"\n"Pretože som sľúbil manželke, že sa moje pery pivného pohára už nikdy nedotknú!"              ', 139, 3.33, 1),
	(224, '"Mám stále väčšie a väčšie problémy s pitím piva." hovorí Fero svojmu susedovi v hostinci.\n"Čo, zdravie?"\n"Nie, nedostatok peňazí..."              ', 161, 3.14, 1),
	(225, 'Príde muž neskoro domov, celý ožratý. Žena sa mu vyhráža:\n"No počkaj, veď ty uvidíš."\n"No to asi ťažko. Pili sme totiž denaturák."              ', 160, 3.63, 1),
	(226, 'Naštvaná manželka sa sťažuje mužovi, že trávi každý večer v krčme. On jej vraví:\n"Tak tam poď so mnou."\nIdú teda spolu do baru a manžel sa pýta,čo si dá.\n"To, čo ty." odpovie manželka.\nManžel objedná dva panáky whisky a jeden hneď kopne do seba. Manželka ochutná, zamračí sa, vypľuje to a vraví:\n"Fúj, ako to vôbec môžeš piť?!?"\n"No vidíš, a ty si myslíš, že sa tu každý večer bohvie ako bavím."              ', 455, 4, 1),
	(227, 'Muž sa vracia neskoro v noci domov zo šenku. Žena mu hovorí: \n"To je výborné, do noci sedíš v šenku, prídeš domov, zobudíš ma a ja už potom nemôžem zaspať."\n"No vidíš, keby si mi dávala viacej peňazí, chodil by som domov až ráno."              ', 268, 3.33, 1),
	(228, '"Požičaj mi dvadsať korún na pivo!"\n"Nemám, ale ak chceš, môžeme ísť do šenku a ja za teba zostanem dlžný..."              ', 136, 3.27, 1),
	(229, 'Manžel ide na oslavu. Žena mu hovorí:\n"Pi s mierou!"\n"Jasné, aj vedro je miera."              ', 98, 3.71, 1),
	(230, 'Ožratý chlap príde na vrátnicu spolku abstinentov.\n"Prosím vás, je tu spolok abstinentov?"\n"Áno, chcete sa zapísať?"\n"Nie, odhlásiť!"              ', 158, 3, 1),
	(231, 'Prečo máme na Slovensku veľa pekných žien?\nLebo máme veľa opitých mužov ...              ', 98, 3.53, 1),
	(232, 'Nasadne opilec do taxíku a hovorí: \r\n"Domov, prosím." \r\n"Môžete to nejak upresniť?" \r\n"Do obývačky."              ', 122, 3.47, 1),
	(233, 'Strašne opitý chlap sa plazí po ulici a vykrikuje:\r\n”Ja už viac nepijem, ja už viac nepijem! Toto je akurát.”              ', 133, 4.13, 1),
	(234, 'Manželka hovorí mužovi: \r\n”Ak neprestaneš chľastať, tak ma z teba porazí!”\r\n”Sľubuješ, drahá?”              ', 126, 3.33, 1),
	(235, 'Mierne podnapiteho vodiča stopnú policajti:\r\nPán vodič, musíte sa podrobiť dychovej skúške.\r\nVodič odpovedá: Prosím Vás, páni policajti, veľmi sa ponáhľam zaparkovať, tam za rohom som videl voľné parkovacie miesto. Zaparkujem a vrátim sa.\r\nPolicajti súhlasia.\r\nO chvíľu sa vodič vracia peši a policajti mu hovoria: Tak Vás poprosíme, aby ste sa podrobili dychovej skúške.\r\nVodič im odpovedá: A kto to kedy videl dávať dychať chodcovi!              ', 482, 3.29, 1),
	(236, 'Ide nenormálne opitý človek po ulici začne klopať na lampu. Príde unavená a rozčúlená stará pani v župane za ním a hovorí: "Čo klopete na tu lampu? Opilec: "To nemôže byť lampa! Veď tam bývam! Po dlhom čase presviedčania pani povedala: "Tak dobre! Nemusíte klopať, nikto neni doma." Opilec: "To je blbosť! Potom mi vysvetlite prečo sa tam svieti!"              ', 387, 2.63, 1),
	(237, 'Viete aká musí byť komora s alkoholom?\r\nDobre zatvorená.              ', 74, 3.22, 1),
	(238, '"Prečo nášmu dedkovi hovorili národný buditeľ?"\r\n"Lebo keď išiel z krčmy, zobudil tri dediny."              ', 117, 3.44, 1),
	(239, 'Príde chlapík do krčmy a pýta sa vrchného:\r\n"Bol som tu včera večer?"\r\n"Áno, bol."\r\n"A prepil som celú výplatu?"\r\n"Úplne celú."\r\n"Chvála Bohu, už som si myslel, že som ju stratil..."              ', 211, 3.93, 1),
	(240, '"Jano, hádaj, čo mám vo vrecku? Začína to na P."\r\n"Peniaze?"\r\n"Nie, pollitrovku! A hádaj, čo mám v druhom vrecku? Začína to na E."\r\n"Deži, to naozaj neviem!"\r\n"Ešte jednu!"              ', 198, 3.73, 1),
	(241, '"Pani Nováková," vyzvedá sa suseda, "a je to protialkoholické liečenie dobré?"\r\n"Asi áno, pani suseda. Môj muž tam ide už tretí raz."              ', 158, 2.5, 1),
	(242, 'Opitý Jano ide domov a rozmýšľa, čo povie svojej veľmi zlostnej žene, a tak si stále opakuje:\r\n"Vidíš miláčik, ožral som sa ako sviňa."\r\nKeď príde domov, otvorí mu žena a Jano zo seba dostane:\r\n"No vidíš, ty sviňa, ako sa tvoj miláčik ožral?"              ', 280, 3.43, 1),
	(243, '"Mäkkne mi mozog!"\r\n"A čím ho liečiš?"\r\n"Tvrdým alkoholom."              ', 79, 4.21, 1),
	(244, 'Dvaja pijani sa rozprávajú:\r\n"Som taký smädný, že by som vypil celé pivo na ex."\r\n"To je nič. Ja som taký smädný, že by som na ex vypil dva deci vody."              ', 177, 3.4, 1),
	(245, 'Príde synček domov a pýta sa mamičky: \r\n”Mami, aký je rozdiel medzi teóriou a praxou?”\r\n”No, teória je taká, že otec povie ”idem na jedno pivo” a prax je taká, že príde ožratý ako sviňa.”              ', 228, 3.67, 1),
	(246, 'Majiteľ obchodu s liehovinami telefonuje v noci na políciu:\r\n”Rýchlo príďte, niekto mi vykradol obchod!”\r\nKomisár vyslal stíhaciu skupinu.\r\nZa pol hodiny vedúci skupiny podáva správu vysielačkou:\r\n”Už sme ich chytili. Boli to nejakí mládenci.”\r\n”Gratulujem,” chváli ho komisár, ”ako to, že sa vám ich podarilo chytiť tak rýchlo?”\r\n”To viete, utekali po štyroch.”              ', 417, 3.2, 1),
	(247, 'Rozprávajú sa dve ženy:\r\n”Môj muž stále chľastá a ja už neviem, čo mám na neho použiť, aby prestal.”\r\n”Sprav to ako ja. Do vane daj víno, hoď tam zdochnutého kocúra, a keď sa vráti z práce, tak ho pošli okúpať sa.”\r\nŽena tak spravila. Muž sa vrátil z práce, poslala ho okúpať sa. Čaká desať minút, pol hodiny, hodinu, dve. Už to nevydrží, vletí do kúpeľne a vidí muža vyvaleného v prázdnej vani ako žmýka kocúra a vraví:\r\n”Hik, kocúrik ešte kvapôčku!”              ', 528, 4, 1),
	(248, 'V bare:\r\n”Predstav si, včera zomrel náš najlepší zákazník.”\r\n”Ten čo každý deň vypil 10 poldeci a 5 pív? A na čo zomrel?”\r\n”Nemám ani potuchy.”              ', 183, 4.17, 1),
	(249, 'Hovorí Fero Mišovi:\r\n”Ja na zlepšenie trávenia pijem pivo, pri nechutenstve pijem biele víno, ked mám nízky tlak pijem červené víno, keď ho mám vysoký, tak pijem koňak a keď som nachladnutý, tak si dám rum. ”\r\n”A kedy piješ vodu?” vyzvedá Mišo. \r\n”Takú chorobu som ešte nemal...”              ', 327, 3.44, 1),
	(250, 'Na rádiu Jerevan:\r\nSlovensko sa podľa najnovších informácií umiestnilo na druhom mieste v pití alkoholu.\r\nŽena sa pozrie na muža a muž vraví:\r\n”Čo pozeráš? Robím, čo môžem.”              ', 209, 4.2, 1),
	(251, '”Zdravím vás, suseda! Od čoho ste tak zachrípli?”\r\n”Ale! Starý prišiel v noci ožratý z krčmy.”              ', 125, 2.9, 1),
	(252, 'Mestský policajt stretne opitého Fera:\r\n”Odkiaľ, odkiaľ?”\r\n”Zo silvestrovskej zábavy.”\r\n”Netárajte, veď je september.”\r\n”Veď práve preto sa tak ponáhľam...”              ', 197, 3.6, 1),
	(253, 'Manžel sa vracia z krčmy. Po tme sa snaží dostať do spálne. Stále však do niečoho naráža. Nakoniec sa nahnevá a zakričí:\r\n”Do kelu, tak už mi začni konečne nadávať, nech sa môžem zorientovať, kde je tá posteľ!”              ', 252, 3.33, 1),
	(254, 'Príde chlap k lekárovi, ten ho prehliadne a vraví:\r\n”Človeče, vy musíte piť ako dúha! Mali by ste to obmedziť.”\r\n”No áno, ale to je strašne ťažké.”\r\n”No, tak skúste napríklad miesto každého pol litra zjesť jablko.”\r\n”No, ... ale kde vezmem denne šesťdesiat jabĺk?”              ', 316, 2.33, 1),
	(255, 'Hovorí Fero Mišovi:\r\n”Počuj Mišo, ty si zase včera načierno pálil nejakú lavórovicu!”\r\n”Ale, čo ťa nemá... Ako ti to  zišlo na um. Nepálil.” bráni sa Mišo.\r\n”Len sa priznaj. Tvoji králici v noci môjmu vlčiakovi zase papuľu rozbili.”              ', 278, 3.5, 1),
	(256, 'Príde pacient za doktorom a hovorí mu:"Pán doktor, po mne stále behajú také biele myšky.\r\nA doktor na to:"Nehádžte ich na mňa!"              ', 151, 2.86, 1),
	(257, 'Manžel zhrozene vraví žene:\r\n”Pre pána kráľa, ako je možné, že si do fľaše od rumu dala vodu?”\r\n”A čo sa také strašné stalo?!”\r\n”No, ešte sa pýtaj... Veď si ma mohla otráviť!”              ', 221, 3.22, 1),
	(258, 'Žena sa hnevá:\r\n”Už zase piješ?! A to si mi tvrdil, že sa z teba stal celkom iný človek!”\r\n”Tvrdil... Ale to som ešte nevedel, že ten iný človek chce tiež piť!”              ', 195, 2.78, 1),
	(259, 'Opilec sa vracia zo silvestrovskej zábavy a pýta sa:\r\n”Prosím vás, ako sa dostanem na stanicu?”\r\n”Musíte ísť stále rovno...”\r\n”Do kelu, tak to sa tam dnes nedostanem!”              ', 201, 3.43, 1),
	(260, 'Spoločensky unavený pán si ľahol v parku na lavičku. Ide okolo policajt a zatrasie ním:\r\n”Človeče, bežte preč! Tu nemôžete ležať!”\r\n”Ležať náhodou môžem,” odpovie pán, ”ísť nemôžem...”              ', 234, 3.67, 1),
	(261, 'Manželka príde z práce domov a vidí, že manžel špekuluje s niečím v kuchyni:\r\n”Konečne si doma a nie v krčme.” poteší sa. ”Čo robíš?”\r\n”Destilátor.” odpovedá muž.              ', 207, 3.67, 1),
	(262, 'Pýta sa Jano kamaráta:\r\n”Peter, kúpil si si na dovolenke nejaké suveníry?”\r\n”No, nakúpil som ich veľa, ale na spiatočnej ceste sme všetky vypili.”              ', 177, 3.6, 1),
	(263, 'Do reštaurácie príde stará pani. Všade je obsadené, len pri jednom stole sedí osamelý anonymný alkoholik. Pýta sa ho:\r\n”Pane, mohla by som si k vám prisadnúť?”\r\n”Len si prisadnite, pani. Ale upozorňujem vás, že po treťom pive som hrozný hulvát.”\r\n”A koľké pivo teraz pijete?”\r\n”Piate! Ty stará sprostá ochechula!”              ', 366, 3.25, 1),
	(264, 'Rozprávajú sa dvaja chlapi v krčme:\r\n”Ako ten týždeň letí. Človek nestihne ani vytriezvieť a už je tu zase piatok...”              ', 145, 4, 1),
	(265, 'Príde opitý chlap domov. Uvidí ho jeho žena a vraví mu:\r\n”Ty máš teda riadnu opicu.”\r\nOn sa na ňu pozrie a odpovedá:\r\n”Aspoň, že si sebakritická.”              ', 180, 3.96, 1),
	(266, 'Slovák príde v Čechách do baru a hovorí barmanovi:\r\n”Jednu whisky.”\r\n”Skotskou?”\r\n”Nie, bez kocky.”              ', 130, 3, 1),
	(267, 'Rozhovor medzi dvoma ožranmi:\r\n”Ty, počuješ ako pekne spieva škovránok?”\r\n”To nie je škovránok, ale pstruh.”\r\n”Čo? Si nenormálny, či čo? Pstruh? O tretej ráno?”              ', 198, 3.71, 1),
	(268, 'Doktor hovorí svojmu pacientovi : \r\n-Prečo toľko pijete ?\r\n-Lebo mám starosti . \r\n-Lenže vy pijete toľko, že ste tie vaše starosti museli už dávno utopiť !\r\n- Neverte, pán doktor. Ony sa beštie, naučili plávať . \n', 229, 3, 1),
	(269, 'Rozhovor:\r\n”Ja vždy, keď prídem opitý domov, tečie mi z nosa krv.”\r\n”Chápem, aj ja mám takú manželku.”              ', 133, 4.2, 1),
	(270, 'Prišiel Jano do hostinca a kamaráti sa ho pýtajú: Tak čo, ako sa cítiš po včerajšom fláme? Ja celkom dobre, ale žena zachrípla.              ', 153, 2.7, 1),
	(271, 'Aj majster tesár sa niekedy utne.\r\nMinule sa tak uťal, že ho museli niesť domov.\n', 85, 2.91, 1),
	(272, 'Príde podnapitý muž do krčmy a na pulte si všimne 5 litrový pohár plný 100 korunačiek. \r\nOpýta sa barmana, čo to majú.\r\nBarman odpovie:\r\nTen kto chce získať ten pohár musí zaplatiť 100,-Sk a splniť 3 úlohy.\r\nMuž vhodí 100,-Sk a pýta sa čo má urobiť.\r\nBarman na to:\r\nPo prvé: Vypiť fľašu TEKILY\r\nPo druhé: Na dvore je besný pes, tomu vytrhnúť boľavý zub\r\nA po tretie: Na 3.poschodí býva 70 ročná babka, ktorá ešte nemala muža a tú treba.....\r\nMuž na to kývne, bez problému.Chytí fľašu, exne ju, vybehne na dvor odkiaľ sa začnú ozývať divné zvuky a štekot. V tom vbehne nazad do baru a pýta sa:\r\n"A kde je tá baba s tým boľavým zubom?"              ', 708, 3.72, 1),
	(273, 'Nabehne chlapík do predajne a volá:\r\n”Dva deci vína!”\r\n”Ale pane, zmýlil ste si dvere, tu predávame starožitnosti.”\r\n”Tak jednu starorežnú, prosím!”              ', 183, 3, 1),
	(274, 'Hovorí suseda susede:\r\n”Môj starý si každý večer hodí korunou, že či má ísť ho krčmy alebo nie. Keď padne znak, tak ide.”\r\n”A keď nepadne, tak sedí doma?” čuduje sa suseda.\r\n”Nie, hádže ešte raz!”\n', 229, 3.33, 1),
	(275, 'Nahnevaná žena:\r\n”Ako si to predstavuješ, prísť domov napoly opitý?”\r\n”Ja za to nemôžem, došli mi peniaze.”              ', 138, 2.5, 1),
	(276, 'Vojde do krčmy dvojica a v strede vlečú tretieho, ktorý je už zjavne pod parou. Prídu k baru a zakričia:\r\n”Dve borovičky!”\r\nBarman sa ich prekvapene opýta:\r\n”Nie náhodou tri borovičky?”\r\n”Nie, ten medzi nami nemôže, on je šofér.”              ', 270, 3.67, 1),
	(277, '”Včera som videl nechutne ožratého chlapa.” hovorí pán Mrkvička v hostinci priateľom.\r\n”A kde presne?”\r\n”V zrkadle...”              ', 151, 2.6, 1),
	(278, 'Fero vraví známemu:\r\n”Moja žena chodí každý večer so mnou do krčmy.”\r\n”A to jej dovolíš?”\r\n”Jasné. Vieš, ako by sa mi samému zle išlo domov?”              ', 181, 2.8, 1),
	(279, '”Ste presvedčený, že obžalovaný bol naozaj opitý?”\r\n”No, s istotou to tvrdiť nemôžem, ale čudný sa mi zdal už vtedy, keď ku mne prišiel s poklopom od kanálu a chcel ho prehrať na gramofóne.”              ', 229, 3, 1),
	(280, 'Stretnú sa dvaja podgurážení mládenci a začnú konverzáciu:\r\n”Ty chuj!”\r\n”Ja že som chuj?!”\r\n”Veď ty ani chuj nie si!”\r\n”Ja že nie som chuj?!”              ', 182, 3.71, 1),
	(281, 'Peter, kúpil si si na dovolenke nejaké suveníry? \r\nNo, nakúpil som ich veľa, ale na spiatočnej ceste sme ich všetky \r\nvypili. \n', 134, 3, 1),
	(282, 'Sudca hovorí obžalovanému:\r\n”Ste obžalovaný, že ste riadili auto v podnapitom stave.”\r\n”To nie je pravda, pán sudca. Bol som opitý práve tak, ako vy teraz.”\r\n”Zapisovateľ, poznamenajte, že obžalovaný priznáva svoju vinu!”              ', 261, 3.86, 1),
	(283, 'Príde ožratý muž domov a hovorí žene:\r\n”Prepáč, že som prišiel neskôr, ale hrali sme šach.”\r\nŽena na to:\r\n”Určite šach, veď je z teba cítiť borovičku!”\r\n”A čo má byť zo mňa cítiť? Šachovnicu?”              ', 244, 4.14, 1),
	(284, 'Muž príde do obchodu a pýta sa predavačky:\r\n”Prosím vás, tá vodka, čo som včera u vás kupoval, bola čerstvá?”\r\n”Áno, samozrejme!”\r\n”Ale mne z nej bolo trochu tažko od žalúdka, keď som vypil dve fľašky.”              ', 247, 3.75, 1),
	(285, 'Príde ožratý chlapík do predajne lahôdok.\r\n”Prosím vás... hik... máte okenú?”\r\n”Nie.”\r\n”A to si hovoríte lahôdky?”              ', 151, 3.55, 1),
	(286, 'Opitý chlap zastaví okoloidúceho chodca:\r\n”Prosím vás, hik, koľko hrčí, hik, mám na čele?”\r\n”Tri.”\r\n”Výborne, hik. Ešte dva stĺpy a som doma.”              ', 181, 2.8, 1),
	(287, 'Stretnú sa dvaja ožratí mládenci a začnú konverzáciu:\r\n”Ty chuj!”\r\n”Ja že som chuj?!”\r\n”Veď ty ani chuj nie si!”\r\n”Ja že nie som chuj?!”              ', 176, 3.27, 1),
	(288, 'Opilec zaklope na dvere. Otvorí mu staršia pani. Opilec sa pýta:\r\n”Môžem si u vás nechať dva litre vodky a tri litre vína?”\r\n”Môžete.”\r\n”Bueeeeee...”              ', 185, 3.07, 1),
	(289, 'Na súťaži v pití alkoholu hovorí moderátor:\r\n”Do arény vstupuje americký reprezentant. Bude piť zo štamprlíkov.”\r\nAmeričan vypije prvý štamprlík, druhý, tretí a už je hotový. Kým odnášajú amerického reprezentanta, ruský borec sa v blízkom bare rozcvičuje pohárom vína.\r\n”A už nám nastupuje japonský reprezentant! Bude piť z poldecákov.”\r\nJaponec vypije prvý poldecák, druhý, tretí a už je hotový aj on. Kým odnašajú japonského reprezentanta, posilňuje sa ruský reprezentant v blízkom bare pohárom vína.\r\n”Konečne nastúpil aj ruský borec. Bude piť z horčičákov.”\r\nRus vypije prvý horčičák, druhý, tretí, štvrtý a treba ísť po novú fľašu. Kým prinášajú novú fľašu, ruský reprezentant sa v blízkom bare rozcvičuje pohárom vína...              ', 833, 3.67, 1),
	(290, 'Dvaja sklerotici pri pive:\r\n- Ty, ja som už zase zabudol tvoje meno.\r\n- No a dokedy to potrebuješ vedieť?              ', 122, 3.77, 1),
	(291, '- Nemám nič proti tomu, aby si išiel na pivo, - hovorí pani Nováková svojmu manželovi. - Iba chcem, aby si bol do ôsmej doma.\r\n- Tak dobre. - odpovie naradostene pán Novák. - Do ôsmej budem doma a potom pôjdem na pivo.              ', 244, 3.68, 1),
	(292, 'Starý notorik sedí doma a rozmýšľa, či má ísť do krčmy. Zrazu odniekadiaľ začuje hlas:\r\n- Poď do krčmy!\r\nRozhliadne sa okolo, ale nikoho nevidí, tak sedí ďalej. O chvíľu opäť:\r\n- Poď do krčmy!\r\nKeď sa to ozve aj tretíkrát, už to nevydrží a vykríkne:\r\n- Do kelu, čo to je? Kto si zo mňa robí srandu?!\r\n- Nikto. To som ja tvoja pečeň. Poď do krčmy, predsa nebudeme tvrdnúť doma.              ', 429, 3.83, 1),
	(293, 'Na námestí zatvára pracovník vodární taký ten veľký zo zeme trčiaci kohútik na vodu. Točí s ním a točí a točí. Pozerá sa naňho jeden opitý muž, príde za ním, poklepe ho po pleci a vraví:\r\n- Počúvaj, ešte raz otočíš tým námestím, tak ti jednu vrazím!              ', 298, 3.71, 1),
	(294, 'Ide Fero, opitý ako doga, v noci domov a zaklope na susedný byt. Ktosi otvorí, Fero sa chce vrútiť do vnútra, keď ho ten vo dverách zastaví:\r\n- Človeče, choďte preč, vy tu nebývate!\r\nFero si čosi zamumle a odíde. Spraví kolečko okolo domu a opäť zaklope na ten istý byt. Domáci pán ho zas mierne namosúrený vyhodí. Ferovi sa však aj do tretice podarí zaklopať na ten istý byt.\r\n- Človeče, hovorím vám, že vy tu nebývate!!!\r\nFero naňho zazrie a ťažkým hlasom hovorí:\r\n- Hlavnééé..., že ty bývaš všade!!!              ', 564, 3.79, 1),
	(295, 'Pivo má vitamínov málo a preto ho pijeme veľa.              ', 64, 3.44, 1),
	(296, 'Viete, čo je maximálny boj proti alkoholizmu?\r\nKeď zastrelíte dieťa so sáčkom rumových praliniek!              ', 119, 2.57, 1),
	(297, '- Čo robí váš manžel? \r\n- Leží v nemocnici. \r\n- A na čo sa sťažuje? \r\n- Na nedostatok piva.              ', 115, 3.4, 1),
	(298, '- Čo popíjate večer pri televízii?\r\n- Čaj a slivovicu.\r\n- A chutí vám to?\r\n- Veľmi, moja žena pije čaj a ja slivovicu.              ', 142, 4.07, 1),
	(299, '- Nie som si moc istý diagnózou, pán Novák, ale pravdepodobne to bude z nadmerného požívania alkoholu. \r\n- Dobre, pán doktor. Ja prídem zajtra, keď budete triezvy.              ', 187, 3.27, 1),
	(300, '- Ešte nikdy som nevidel toľko suchých húb ako v nedeľu.\r\n- Nevrav, ty si bol v nedeľu v hore?\r\n- Nie. V krčme a došlo pivo.              ', 146, 2.89, 1),
	(301, '- Vojak Metlička, vy neviete, že pitie vína vo veľkom množstve zabíja?\r\n- Vojak sa nesmie smrti báť, pán kapitán!               ', 138, 3.33, 1),
	(302, '- Prosím vás, máte denaturovaný lieh?\r\n- Nie.\r\n- A nejaké iné fajné vínečko?              ', 99, 3.33, 1),
	(303, '- Nepite. Každý pohárik je klinec do vašej truhly.\r\n- No a čo na tom, že moja truhla bude vyzerať ako jež?\n', 115, 3.7, 1),
	(304, '- Koľko tak znesú vaše sliepky?\r\n- Asi dve deci rumu, potom už zvracajú.              ', 91, 3.67, 1),
	(305, '- Kámo, včera si bol taký spitý, že si predal Slavín za tisíc korún.\r\n- No a? Už aj to ti vadí?\r\n- Hej, ja som ho kúpil!              ', 145, 3, 1),
	(306, '- Karol, taký opitý si predsa nemôžeš sadnúť za volant, veď cesta je samá zatáčka !\r\n- Tie zatáčky mi nevadia, ale tie rovné úseky...              ', 162, 3.73, 1),
	(307, 'O´Brian príde do baru a objedná si naraz päť frťanov a naraz ich vypije. Takto to ide aj druhý deň, tretí ... až sa ho barman spýta: \r\n"Prečo si tie frťany nedáte postupne?" \r\n"Nás je totiž päť kamarátov a sme zvyknutí sa takto stretávať. No a tí štyria sú ďaleko, tak pijem za nich." Takto pokračuje ďalej, až raz si miesto piatich, dá len štyri. \r\n"Čo sa stalo? Umrel vám kamoš?" \r\n"Nie, ja som prestal piť..."              ', 461, 3.81, 1),
	(308, 'Stretnú sa dvaja poriadne napití na WC pri pisoároch. Jeden ciká a chce si prdnúť. V tom sa poserie a ako to zacíti, tak z toho ešte začne nepríjemne zvracať, že mu to lieta nielen z úst, ale aj z nosa. Ako vidí celú tu spúšť, čo narobil, tak sa nad tým ešte chudák rozplače. Vtedy sa mu prihovorí ten druhý: \r\n- Ty človeče, to je dobré! A s ušami nejaké finty nevieš?              ', 413, 4, 1),
	(309, 'Aj majster tesár sa utne. Minule sa v krčme tak uťal, že ho domov odniesli.              ', 93, 2.44, 1),
	(310, 'Novinárka išla po predmestí a všimla si jedného malého starčeka, ako sa na hojdacom kresle vyvaľuje na slnečných lúčoch. Dostala nápad a ide k nemu: \r\n"Dobrý deň, pane. Nemohla som si nevšimnúť, ako vyzeráte spokojne. Mohli by ste mi pre naše noviny prezradiť recept na spokojný dlhý život?" \r\n"Fajčím denne tri krabičky cigariet, za týždeň vypijem bedňu whisky, jem mastné jedlá a zásadne necvičím." \r\n"To znie naozaj zaujímavo. A koľko máte rokov?" \r\n"Tridsaťjeden."               ', 523, 4.08, 1),
	(311, 'Príde pacient k lekárovi a vraví: \r\n- Veľmi sa mi trasú ruky, pán doktor. \r\n- Asi veľa pijete... \r\n- Ale kdeže, pán doktor, veď skoro všetko porozlievam!\n', 165, 3.77, 1),
	(312, 'Príde chlapík do Francúzskej reštaurácie a zrúbe sa tam francúzskym koňakom ako motyka. Keď je už naozaj namol, príde k nemu čašník s účtom.\r\n- "A be-be-rete aj pperly?", pýta sa opilec.\r\n- "Samozrejme pane."\r\n- "T-tak mi prineste, tri-tri-trikrát ustrice a držšte mi p-palce."              ', 311, 3.4, 1),
	(313, '\r\nOpilec sa nadránom vracia zo zábavy:\r\n- Prosím Vás, ako sa dostanem na stanicu?\r\n- To musíte ísť stále rovno...\r\n- No doprčic! Tak, to sa tam dnes nedostanem.              ', 183, 3.4, 1),
	(314, 'Dvoch lyžiarov zasypala na horách lavína. Zrazu ten jeden vidí, ako sa k nim blíži bernardýn so súdkom. A tak vraví tomu druhému: - Pozri, najlepší priateľ človeka.\r\n- A fakt, a nesie ho pes.              ', 219, 4.2, 1),
	(315, 'V krčme si podnapitý muž uprene prehliada dvoch chlapíkov u vedľajšieho stola. Nakoniec mu jeden z nich povie:\r\n- Žiadny strach, nieste opitý. My sme dvojičky.\r\n- Čože?! Všetci štyria?              ', 211, 2.8, 1),
	(316, 'Leží kapustnica na dne žalúdku, keď tu zrazu priletí veľký rum. Vzápätí ešte jeden a dva veľké fernety. To už kapustnica nevydrží a povie: \r\n"Tam hore je nejako veselo, asi sa tam pôjdem pozrieť!"              ', 229, 3.88, 1),
	(317, 'Nasadne opilec do taxíka a vraví: \r\n"Prosím, domov." \r\n"Môžete to nejako upresniť?" \r\n"Do obývačky."              ', 122, 3.68, 1),
	(318, 'Prvý investičný fond alkoholikov:\r\nSpojíme Vaše peniaze s našim smädom!\n', 79, 2.89, 1),
	(319, 'Traja Škóti sedeli pri bare.\r\n"Keď umriem," hovorí starý Škót, "polejte môj hrob najlepšou škótskou whisky."\r\n"To pre teba urobíme," povedal jeden z mladších mužov.\r\n"Ale nebude ti vadiť, keď tá whisky najprv prejde našimi ľadvinami?"\n', 255, 3.33, 1),
	(320, '"Prečo máš tak odretú hubu?"\r\n"Ale, včera večer mi vyhodili z krčmy kabát."\r\n"A ako to súvisí s krvou v ksichte?"\r\n"Ja som bol v tom kabáte oblečený."\n', 164, 3.44, 1),
	(321, 'Stretnú sa dvaja opití pred bránkou a začnú sa rozprávať:\r\n"Nazdar! Ja som Mišo Novák."\r\n"To nie je možné! Ja som tiež Mišo Novák!"\r\n"Ale ja tu bývam."\r\n"Ja tu tiež bývam!"\r\n"Tak ideme dovnútra, nech nám to niekto vysvetlí."\r\nZazvonia, vyjde žena a začne kričať:\r\n"No to je nádhera. Otec a syn a ožratí ako prasce!"\n', 343, 3.97, 1),
	(322, '"Pán doktor, mám červený nos. Dá sa proti tomu niečo robiť?"\r\n"Ak je taký od narodenia, tak nič. Ak je to od pitia, tak musíte piť ďalej a časom vám sfialovie."\n', 175, 3.2, 1),
	(323, 'Príde do krčmy chlap s čiernou mačkou v náručí. Objedná pohárik rumu a pohárik benzínu. Hodí do seba rum a benzín naleje do mačky. \r\nMačka začne lietať po krčme, až nakoniec padne na zem mŕtva. Krčmár sa udivene pýta:\r\n"Čo sa jej stalo?"\r\nA majiteľ hovorí:\r\n"No, čo ja viem, asi došiel benzín."\n', 324, 3.43, 1),
	(324, 'Príde chlap do baru a povie barmanovi:\r\n"Jedno suché Martini."\r\nKeď ho dostane, vytiahne z neho olivu a hodí ho do seba. Objedná si ďalšie a spraví to isté. \r\nTakto ich vypije pätnásť a díva sa na hromádku olív:\r\n"Barman, je to desať deka?"\r\n"Asi áno, prečo sa pýtate?"\r\n"Ale, manželka ma poslala pre desať deka olív."              ', 354, 3.43, 1),
	(325, 'Ide opilec z krčmy, strašne ho motá, naraz sa mu urobí hrozne zle, oprie sa o múr a začne zvracať. Po chvíľke pribehne odniekiaľ pes a začne tie zvratky očuchávať. Opilec sa pozrie dole a vraví: \r\n"Sakra, to by ma zaujímalo, kde som zožral toho psa."              ', 281, 3, 1),
	(326, 'Muž s poriadne veľkým bruchom stál pred materskou školou. Z okna sa vyklonila mladá učiteľka a spýtala sa:\r\n- Čakáte dieťa?\r\nMuž sa usmial a zdvorilo odpovedal:\r\n- Nie, to mám od piva.              ', 212, 4.21, 1),
	(327, 'Večerná konverzácia. Naštvaná manželka vyčíta manželovi: \r\n"Prosím ťa, prečo mi to robíš? Ako môžeš prísť domov takto neskoro a ešte napoly ožratý?" \r\n"Ja za to nemôžem, došli mi peniaze."              ', 227, 3.4, 1),
	(328, 'Súťaž v ochutnávaní vína:\r\nPo prvom kole vypadlo 70 ľudí. V ďalších kolách zostal už len jeden človek..\r\nUsporiadatelia už nevedia, čo by mu predložili. \r\nNakoniec mu ale podávajú posledný pohárik. On  pričuchne, trochu upije, vypľuje to a zakričí:\r\n"Veď je to petrolej!"\r\nOni na to:\r\n"Správne, ale ktorý ročník?"\n', 344, 2.89, 1),
	(329, 'Vojde drsňák do baru. Na dlážke uvidí úplne hotového chlapíka, tak povie barmanovi: \r\n"Phil, daj mi dvojitú toho, čo mal on."              ', 149, 3.8, 1),
	(330, 'Pýta sa hosť čašníka: \r\n- Čo mám robiť, aby ste mi v tomto alkoholickom hniezde priniesli vodu?\r\n- Zapáľte obrus.              ', 137, 3.73, 1),
	(331, 'Nové zistenie vedcov: Človek pochádza zo slivky. Dôvod: Zo sliviek je slivovica, zo slivovice opica a z opice človek.              ', 136, 3.71, 1),
	(332, 'Opilec sa potáca po ulici a vrazí do neznámej ženy. Tá mu dá hneď facku, až sa zatočí. Keď sa spamätá zo šoku, hovorí:\r\n- To už som doma, Cecilka?              ', 176, 3.43, 1),
	(333, 'Ide opitý chlap z krčmy a už to nemôže vydržať, tak sa oprie o najbližší dom a začne si uľavovať. V tom sa s okna vykloní jedna nájomníčka a zakričí:\r\n"Prestaňte s tým lebo zíde omietka".\r\nOpitý chlap len dvihne hlavu a povie:\r\n"Nech len zíde a ja si to s ním vybavím!?"              ', 310, 3.8, 1),
	(334, 'Príde chlapík do lahôdok a hovorí:\r\n- Máte okenu?\r\n- Nie.\r\n- A to si hovoríte lahôdky?!?              ', 109, 3, 1),
	(335, 'vrchní: "dáte si masovou polévku ?"\r\nhost: "Ne, individuální !"              ', 82, 2.67, 1),
	(336, 'Príde chlapík strašne opitý domov. Keď ho takého zbadá manželka, nazúrená podíde k nemu a strelí mu facku z jednej strany.\r\n- Tak budeš piť?\r\nStrelí mu facku z druhej strany.\r\n- Tak budeš piť?\r\nTreskne ho knihou po hlave?\r\n- Budeš piť?\r\nChlapík vyvráti oči a pomedzi zuby pomaly odpovie:\r\n- Tak teda nalej.\n', 329, 4.28, 1),
	(337, 'Vracia sa úplne opitý chlapík domov, vyberie kľúče a odomyká byt. Zrazu vybehne majiteľ bytu a hovorí:\r\n"Sused, prosím vás, veď vy bývate o poschodie vyššie."\r\nChlapík sa pomotá po dome a znovu stojí pri tých istých dverách. Znova vybehne sused a vysvetľuje mu, že býva o poschodie vyššie. Na tretíkrát sa už napitý chlapík nezdrží:\r\n"No, hlavne, že ty bývaš všade!"              ', 417, 3.56, 1),
	(338, 'Výjde vrana z krčmy, párkrat laxne zamáva krídlami a povie:\r\n- Serem na to, idem peši.              ', 106, 3.47, 1),
	(339, 'Jano rozpráva chlapom v krčme:\r\n"Chlapi, mne sa minule sníval strašný sen. Snívalo sa mi, že mám dieru v hlave. Zobudím sa, idem k zrkadlu a tá diera tam naozaj bola."\r\n"A kedy zmizla?" pýtajú sa chlapi. \r\n"Hneď, ako som prestal zívať."              ', 265, 2.91, 1),
	(340, '"Fero, už vieš, že Jožo je mŕtvy!?"\r\n"Neviem!"\r\n"Umrel na schodoch pred dverami do krčmy!"\r\n"A bol na ceste tam, alebo von!?"\r\n"Bol  na ceste tam!"\r\n"Chudák Jožo!"              ', 185, 3.73, 1),
	(341, 'Opitý fanúšik Interu sa vezie domov v autobuse a hovorí vodičovi:\r\n- Keď napočítam do 25, tak sa poblijem.\r\n- Kým vy napočítate do 25 už budeme na konečnej.\r\n- 5 krát 5 je 25... Blueeaaaa.              ', 216, 3.67, 1),
	(342, 'Muž príde domov ožratý ako činka, postaví sa do stredu obývačky a len tak stojí. Po štvrť hodine to už žena nevydrží a hovorí:\r\n"Čo tam stojíš, veď si sadni!"\r\n"Veď hej, hneď, len čo okolo poletí kreslo!"\n', 229, 3.67, 1),
	(343, 'Príde opitý chlapík o druhej v noci na sídlisko a kričí:\r\n"Ľudia!"\r\nRozsvieti sa zopár okien. Vtom chlapík zakričí druhýkrát:\r\n"Ľudia!"\r\nRozsvieti sa polovica sídliska, ale to chlapíkovi nestačí a tak zakričí tretíkrát:\r\n"Ľudia!"\r\nV tú chvíľu sú už všetci hore, pozerajú sa von oknom, čože je to za magora, čo kričí o druhej ráno na sídlisku a chlapík zakričí poslednýkrát:\r\n"Ľudia! Čo nespíte?!"              ', 455, 3.82, 1),
	(344, 'Lekvár je produkt šialenej myšlienky neurobiť zo všetkých sliviek slivovicu.              ', 96, 4, 1),
	(345, 'Ako muž dokazuje, že myslí na budúcnosť?\r\nKúpi dve basy piva miesto jednej.\n', 82, 3.38, 1),
	(346, 'Žena kričí na muža, ktorý sa ožratý vrátil z krčmy:\r\n-Budzeš ešči pic totu borovičku?\r\n-Ha? Še ce daco pytam, budzeš ešči pic totu borovičku?\r\n-povidz daco,ne!?!\r\n-Ta dobre no, ta nalej.               ', 219, 3.56, 1),
	(347, 'Policajt zastaví auto so zjavne opitým vodičom a chce aby fúkal. \r\nChlapík vysvetľuje:\r\n"Som astmatik a nemôžem poriadne fúknuť."\r\nPolicajt teda chce, aby  prešiel po rovnej čiare, ale chlapík zas, že nie. \r\nPolicajt sa pýta:\r\n"Prečo nie?"\r\n"Pretože som na to moc opitý."\n', 290, 3.75, 1),
	(348, 'Vymením vysaváč za demižón vína.\r\nZnačka: Prestal som vysávať, začal som nasávať.              ', 107, 3.45, 1),
	(349, 'Náhle sa prudko zdvihol chodník a silno ma udrel do tváre.              ', 75, 3, 1),
	(350, 'V pive je vitamínu málo, preto ho musíme piť veľa!              ', 69, 3.69, 1),
	(351, 'Psychiater sa pýta alkoholika:\r\n"Fajčíte?"\r\n"Áno," povedal pacient, ponúkol lekárovi cigaretu a ten ju s potešením prijal.\r\nChvíľu potom spokojne fajčili.\r\n"Pijete?" spýtal sa psychiater po chvíli.\r\n"Áno," povedal pacient, "fľašku som ale žiaľ nechal doma."\n', 276, 3.82, 1),
	(352, 'Vbehne chlapík do krčmy a udýchane zavolá:\r\n"Krčmár, jedno pivo, než to príde."\r\nDostane pivo, hodí ho do seba a zavolá:\r\n"Krčmár, ešte jedno, než to príde."\r\nDostane ďalšie. Keď ho vypije, krčmár sa pýta:\r\n"A čo tak zaplatiť?"\r\n"Hmm, už to prišlo..."\n', 277, 4.21, 1),
	(353, 'Ide chlap po ulici a vidí, ako iný chlapík strašne zvracia. Tak k nemu\r\npríde, potľapká ho po chrbte a hovorí:\r\n"Máte pravdu, prečo by ste sa s tým sral."\n', 166, 4.09, 1),
	(354, 'Psychiater sa pýta alkoholika:\r\n"Čo pijete?"\r\n"Ale pán doktor, ja nie som vyberavý. Nalejte kľudne, čo máte."\n', 117, 3.71, 1),
	(355, 'Aký je rozdiel medzi šachistom a alkoholikom?\r\nŽiadny. Obaja sú väčšinou v inom svete a občas na ťahu.\n', 112, 3.75, 1),
	(356, 'Novák dostane v krčme infarkt a kamoši nevedia, ako to povedať jeho manželke.\r\nVysvetľujú:\r\n"Viete, pani Nováková, Váš manžel bol v krčme a opil sa."\r\n"Ako ho poznám, zas hral karty."\r\n"Áno, hral."\r\n"To určite zas prehral kopu peňazí."\r\n"Áno, asi tak 2000."\r\n"Ale, šľak aby ho trafil."\r\n"To aj urobil, pani."\n', 330, 4.09, 1),
	(357, 'Neskoro večer:\r\n"Mami, mami, ocko je zase opitý?"\r\n"A na to si ako prišla?"\r\n"Je v kúpelni a holí zrkadlo..."\n', 115, 3.73, 1),
	(358, '"Čítal si o škodlivosti alkoholu?"\r\n"Áno."\r\n"A prestal si piť?"\r\n"Nie, čítať."\n', 87, 3.63, 1),
	(359, 'Žena hovorí mužovi:\r\n"Alkohol podražel."\r\nMuž sa zamyslí a hovorí:\r\n"Nedá sa nič robiť, musíme menej jesť."\n', 120, 3, 1),
	(360, 'Príde chlap z krčmy bez oka a bez jednej ruky. Manželka zalomí rukami: \r\n"Preboha, čo si zas robil?"\r\n"Ale, stavil som sa s chlapmi o oko, že mi neutrhnú ruku."\n', 168, 3.2, 1),
	(361, 'Príde ožratý chlap k taxíku a hovorí:\r\n"Ste voľný?"\r\n"Áno."\r\n"A vojde sa vám tam ešte kura a basa pív?"\r\n"Áno."\r\n"BBLeeeeeeeeeeeeeeeeeeeeeah."\n', 155, 4.1, 1),
	(362, 'Príde chlapík k doktorovi, ten ho prehliadne a potom hovorí:\r\n"Človeče, vy musíte piť ako dúha! Mal by ste to obmedziť."\r\n"No áno, pán doktor, ale to je ťažké."\r\n"No tak si skúste miesto každého pollitra dať jablko."\r\n"No pekne... ale kde ja vezmem denne šesťdesiat jabĺk???"\n', 297, 4.14, 1),
	(363, '"Mám si dať ešte jednu alebo si nemám dať ešte jednu? Brucho vraví áno, hlava že nie. Hlava je múdrejšia než brucho. Múdrejší ustúpi."\r\n"Pán vrchný, ešte jednu."\n', 181, 3.65, 1),
	(364, '"Pijete v službe?"\r\n"V službe nepijem, iba keď prídem do práce opitý."\n', 77, 3.2, 1),
	(365, '"Môj manžel je ako Trabant."\r\n"Tiež tak veľmi žerie?"\r\n"Nie, chlastá."\n', 77, 2.43, 1),
	(366, 'Prídu dvaja Íri do krčmy a pýtajú si fľašku whisky. Potom len sedia a bez slova pijú. Keď sú na dne fľašky, objednajú si ďalšiu. A zas ju bez slova vypijú. Nasleduje i tretia, štvrtá… Keď dopili piatu fľašku jeden z nich sa pýta:\r\n"Tak čo, dáme ešte jednu?"\r\nA ten druhý odpovie:\r\n"Prišli sme sem chlastať alebo kecať?"\n', 351, 2.69, 1),
	(367, 'Hádajú sa Brit, Rus a Slovák, kto má silnejší alkohol. Brit sa napije škótskej.\r\n"Koľko vidíš stoličiek?"\r\n"Tri."\r\n"To máš silný alkohol."\r\nRus sa napije vodky.\r\n"Koľko ich vidíš ty?"\r\n"Päť."\r\n"No teda! Tiež máte silný alkohol!"\r\nNakoniec si naleje Slovák slivovice.\r\n"Koľko ich vidíš ty?"\r\n"A v ktorom rade myslíte?"\n', 346, 3.97, 1),
	(368, 'Pred predajňou liehovín leží muž a okoloidúci sa ho pýta: \r\n"Prepáčte, to ste taký opitý, alebo to je reklama?"                                         \n', 164, 3.2, 1),
	(369, 'Potácajúci muž na ulici si mrmle: \r\n"Už nikdy viac nebudem piť, už nikdy viac, ani menej, toto je tak akurát."                                ', 149, 4.1, 1),
	(370, 'Zazvoní chlap u susedov: \r\n- Dobrý deň, minul sa mi doma rum. Tak sa chcem spýtať, či je tá porucha v celom baráku.                  ', 141, 3.92, 1),
	(371, 'Správy: Teroristi, ktorí pred týždňom obsadili vínnu pivnicu v Pavlovciach, ešte stale nemôžu sformulovať svoje požiadavky.                             \n', 164, 4.25, 1),
	(372, 'Aj kat sa vie sťať...              ', 37, 3.31, 1),
	(373, 'Slečna v bare:\r\n- Pane, môžem si prisadnúť?\r\n- Môžete, ale upozorňujem vás, po desiatom pive som strašne sprostý.\r\n- A koľkaté máte?\r\n- Dvanáste, ty krava škaredá.              ', 194, 3.93, 1),
	(374, 'Idú dvaja opitý hadi s krčmy a jeden sa pýta druhého: \r\n-Som ja jedovatý had?\r\n-Ahh, daj pokoj, štik.\r\nPrejdú desať metrov a opäť sa jeden pýta:\r\n-Som ja jedovatý had?\r\n-Šak čo s tým stále máš? neotravuj...\r\nOpäť desať metrov a opäť otázka:\r\n-Som ja jedovatý had?\r\n-No dobre, si, ale uz daj pokoj.\r\n-Do ....., zahryzol som si do jazyka!              ', 376, 3.74, 1),
	(375, 'Do čoho investovať svoje peniaze?\r\nDo alkoholu. Nikde inde nedostaneš 40%.\n', 78, 3.36, 1),
	(376, 'Opilec sa dopotáca do kostola, zapadne do spovednice a mlčí. Zmätený kňaz zakašle, aby upútal pozornosť, ale muž stále mlčí. Kňaz teda zabúcha na prepážku a dúfa, že sa hriešnik rozhovorí. Z druhej strany sa ozve: “Búchaš zbytočne, kámo, tu tiež nie je papier...”              ', 307, 3.33, 1),
	(377, 'Lekár k pacientovi:\r\n- Musíte okamžite s tým pitím prestať! Váša posledná krvná vzorka sa vyparila skôr, než som ju mohol vyšetriť.”\n', 149, 3.43, 1),
	(378, 'Internista k pacientovi:\r\n- Bohužiaľ nemôžem zistiť príčinu vašej choroby. Ale možno je to tým alkoholom.\r\n- Dobre, hik, tak prídem znova, hik, keď budete triezvy.\n', 176, 3.25, 1),
	(379, 'Alkohol je metla ľudstva. Ale či môže chýbať metla v slušnej domácnosti?              ', 94, 3.93, 1),
	(380, 'Dvaja dedkovia idú z prednášky o alkoholizme. \r\n- Sú to ale hlupáci, - rozprávajú sa, - keď to svinstvo - alkohol - pijú. Ako keby sme nemali dosť piva a slivovice.              ', 188, 3, 1),
	(381, 'Ide opitý chlap po cintoríne, spadne do čerstvo vykopaného hrobu a začne volať o pomoc. Ide okolo druhý a nájde chlapíka ležať v jame.- Prečo voláte o pomoc? - pýta sa ho.\r\n- Spadol som sem a je mi tu zima.\r\nDruhý na to:\r\n- Nebola by ti, keby si sa neodkopal.              ', 288, 3.17, 1),
	(382, 'Vnúčik sa pýta dedka:\r\n- Dedko, čo je to abstinent?\r\n- No, u nás v dedine také nemáme, ale počul som, že je to človek, ktorý má buď zlú pečeň, alebo zlú ženu.              ', 190, 3.29, 1),
	(383, 'viete ako sa rozdeluje slovensko??\r\n80% alkoholici.\r\na 20%?? \r\ndeti do 3 rokov...               ', 96, 3.73, 1),
	(384, 'Dvaja alkoholici sa dohovárajú pred obchodom:\r\n"Tak, koľko berieme dnes, tri či dve?"\r\n"Nie, včera sme kúpili tri a jedna zostala. Berieme dve!"\r\nVojdú do obchodu a hovoria:\r\n"Tri vodky a dve Horalky."               ', 223, 3.78, 1),
	(385, 'Príde manžel domov a jeho nenásytná žena mu vraví, že vzhľadom na to, že má narodeniny, si môže robiť, čo chce. Manžel ide do chladničky a naleje si borovičku. Príde k nemu manželka a mu opäť hovorí, že si môže robiť, čo chce. Tak muž ide do chladničky a zase si naleje borovičku. Žena mu vraví:\r\n"Ale môžeš si robiť čo chceš aj so mnou."\r\nManžel hovorí:\r\n"Kľakni si na kolená."\r\nŽena si kľakne, muž na ňu vysadne a kričí:\r\n"Hijó, hijó, na koníčku, do chladničky na borovičku!"              ', 545, 3.33, 1),
	(386, 'Príde opitý do reštaurácie a objedná si koláč s čerešňou navrchu. Koláč už zjedol a ostala mu čerešňa. Opitý sa snaží napichnúť čerešňu na vidličku, ale čerešňa mu odskočí na zem. Hodinu sa trápi, ale čerešňa mu stále odskakuje. Po chvíli príde čašník a napichne mu čerešňu na vidličku. Opitý mu povie:\r\n"To sa ti machruje, keď som ti ju uštval."              ', 407, 3.6, 1),
	(387, '"Haló, tam je poradňa pre alkoholikov?"\r\n"Áno. Aké máte problémy?"\r\n"Povedzte mi, čo sa pije k pečenej husi - biele víno alebo červené?"              ', 161, 2.87, 1),
	(388, 'Na polícii:\r\n"Nechápem, prečo ma priviedli na políciu?" sťažuje sa muž s poriadnou "opicou".\r\n"To kvôli alkoholu." spresňuje službukonajúci seržant.\r\n"Hej? No super! Dajte mi dva deci koňaku."              ', 219, 3.8, 1),
	(389, 'Na železničnej stanici nastúpi totálne ožratý chlap do taxíka a vraví šoférovi:\r\n"Odvezte ma, prosím, na železničnú stanicu."\r\nTaxikár sa otočí dozadu a povie:\r\n"Nech sa páči, ráčte vystúpiť, sme na mieste."\r\nOpilec sa k nemu nakloní so slovami:\r\n"Vďaka! Tu máte kilo a nabudúce nejazdite tak rýchlo."              ', 343, 3.33, 1),
	(390, 'Syn sa pýta otca:\r\n"Oco, aký je to pocit byť opitý?"\r\nOtec vraví:\r\n"Vidíš tých dvoch psov? Keď som opitý, vidím štyroch."\r\n"Oci, ale tam je len jeden pes."              ', 181, 3.38, 1),
	(391, 'Totálne ožratý chlapík vyjde z krčmy, urobí dva kroky a spadne do mláky. Ihneď sa postaví, odpľuje si a hovorí: Poondiaty mikrospánok.              ', 160, 4, 1),
	(392, 'Pacient sa pýta lekára:\r\n”Pán doktor, čo mám robiť, aby som schudol?”\r\n”No, predovšetkým skôr vstávať.”\r\n”Z postele?”\r\n”Nie, od stola.”              ', 176, 3.86, 1),
	(393, 'Alkohol je metla ľudstva. \r\n- Čo Slovák, to zametač.              ', 70, 3.38, 1),
	(394, 'Chlapík vojde do podniku, vidí, že pri bare sedia iba dvaja maníci, tak si objedná drink, prisadne si a počúva konverzáciu. Jeden z nich hovorí: "Ste odtiaľto?" "Áno, bývam hneď tu, na Záhradníckej," odpovedá mu druhý. "Naozaj? Aj ja bývam na Záhradníckej, hneď vedľa drogérie, v tom bielom dome s veľkým hnedým psom," hovorí zase ten prvý. "Ale veď aj ja tam bývam, hneď vedľa drogérie, v tom bielom dome s veľkým hnedým psom. A narodil som sa 14. marca 1962." odpovie mu ten druhý na to. Prvý sa zatvári prekvapene: "No nie je ten svet malý, aj ja som sa narodil 14. marca 1962." Chlapík, ktorý počúva tento rozhovor, je už tiež celkom prekvapený, keď zazvoní telefón. Volá barmanova žena a pýta sa, čo je nové. Barman sa rozhliadne po všetkých troch prítomných a odpovie: "Nič nového drahá, Krkoškove dvojičky sú už zase totálne ožraté..."              ', 925, 3.43, 1),
	(395, 'Bol raz jeden mejdan. Oslavovalo sa až do rána. Keď už boli všetci oslávenci riadne pod parou, napadlo jedného z nich, že by si mohli zalyžovať. Tak vytiahol lyže a začal v paneláku jazdiť po schodoch. Bola nedeľa ráno a jedna babička išla z kostola. Pretože na schodoch sa blbo hádžu oblúky a babička sa rozvášnenému lyžiarovi nestihla uhnúť, stalo sa niečo, čo sa nemalo stať. Babička zostala ležať pod schodami v nie príliš dobrom stave. Oslávenci jej, pochopiteľne, zavolali sanitku a pokračovali ďalej s pitím. Keď už konečne dopili a potom vytriezveli, pokusili sa zistiť, kam nešťastnú babičku odviezli. Išli sa spýtať do najbližšej nemocnice: \r\n"Prosím vás, nepriviezli vám sem ráno tú a tú pani?" \r\n"Jaj tú? Tak tú odviezli rovno do blázinca, vravela, že ju niekto v paneláku zrazil na lyžiach..."              ', 887, 3.83, 1),
	(396, 'Príde právnik do baru, sačko, kravatka a prisadne si k mladému, už trochu opitému mužovi. O chvíľu zistí, že maník si niečo mrmle popod nos.\r\n„Čo ste vraveli?" pokúsi sa nadviazať konverzáciu.\r\n„Igelit alebo guma? Alebo azda hlina? Igelit..." Začne nahlas opilec.\r\n„Prosím?"\r\n„No, pozrite sa, toto tu, čo to môže byť? Guma? Igelit? Alebo guma? Igelit? Asi guma!"\r\n„Ukážte, nech sa pozriem", povie právnik a natiahne ruku. Opilec mu podá bezfarebnú guľôčku. Právnik ju chvíľu stláča v prstoch, potom k nej privonia, jemne do nej zahryzne a povie:\r\n„No, fakt neviem, čo to môže byť. Skadiaľ to máte?"\r\n„Z nosa."              ', 679, 3.77, 1),
	(397, 'Dora sa večer pozerá z okna a vraví kamarátke Mare:\r\n- Ach bože, ten môj Mišo sa už zase vracia z krčmy na mol opitý.\r\nTo zase celú noc nebudem spať.\r\n- To on je potom taký vášnivý milenec? - vyzvedá Mara.\r\n- To nie. On zaľahne a ihneď zaspí, ale ja mu budem celú noc nadávať...              ', 315, 3.4, 1),
	(398, '- Ešte nikdy som nevidel toľko suchých húb ako túto nedeľu.\r\n- Nehovor. Ty si bol v lese?\r\n- Nie, ale v krčme došlo pivo.', 129, 3.07, 1),
	(399, 'Stroskotali traja chlapi na jednom ostrove. Jeden Nemec. Druhý Francúz. Tretí Slovák. Tam ich chytili kanibali a povedali im, že ak im ukážu dačo čo nepoznajú, tak ich pustia domov a nezjedia ich! Nemec ukázal kvalitné Nemecke hodinky a kanibal povedal, že to už poznajú. Francúz ukázal kvalitnú Francúzku krémovú čokoládu, ale tiež to poznali. Slovak sa zobral na to miesto kde stroskotali a našiel tam plný sud piva. Vzal ho aj s náčelníkom kanibalov a začal nalievať do dvoch nádob. Sebe a jemu. Po piatom pive hovori kanibal: Počkaj idem sa vyčúrať a môžme piť ďalej. Slovák vraví nechoď ešte počkaj a neskôr pôjdeme. Po dvanástom pive Slovak vraví: poďme sa vyčúrať! Ako kanibal začal čúrať povedal íaaa toto ešte nepoznám!', 788, 3.43, 1),
	(400, 'Prečo piješ to pivo slamkou?\r\nLebo som žene povedal, že moje pery sa pohára od piva už nikdy nedotknú.\r\n', 111, 3.84, 1),
	(401, 'Otec príde domov napitý ako delo. Otvorí dvere a potkne sa o prah svojho domu. Žena ho zbadá a začne nadávať: "Ty si obyčajný notorik napitý ako delo a keď chceš mat kde bývať tak prestaň piť.', 209, 2.35, 1),
	(402, 'Zvláštna anatómia alkoholikov:\r\n- ...pečeň majú v riti...', 63, 3.46, 1),
	(403, 'Muž chytí zlatú rybku. Rybka mu hovorí, že ak ju pustí, splní mu jedno želanie. \r\nMuž : "Želám si, aby som "čúral" šampanské!"\r\nPo ceste domov sa muž presvedčil, či to funguje a natešený zďaleka kričí na manželku : "Stará priprav dva poháre!"\r\nPo chvíli sa zamyslí a opravuje pokyn:\r\n"Stačí jeden, ty budeš piť z fľaše!"\r\n ', 357, 3.52, 1),
	(404, 'Ide opitý človek okolo obchodu, príde mu zle a vyvracia sa. Vojde do obchodu, chce ísť na WC, ale je zatvorené, tak ide k stĺpu. Staršia pani ide okolo a hovorí: "Och, aká hrubosť." Opitý človek na ňu pozrie a v duchu si povie: "A na dĺžku ste nezabudli?"', 271, 2.56, 1),
	(405, 'Stavia sa Američania, Francúzi a Slováci, kto dlhšie vydrží v mraziacom boxe. Francúzi si zobrali šampanské a boli vnútri dobré dve hodiny. Američania si zobrali po fľaši Whisky a vydržali skoro celý deň. Bača Jano s valachmi, si zobrali po 5 bás borovičky... Po týždni sa Američan šiel pozrieť, či nepomreli. Otvorí box a vtom mu bača jednu vylepí a vyhodí ho von.\r\nValach sa ho pýta:\r\n- Bača, a prečo ste ho, oné, tak zmlátili? \r\n- Boha mu, taká kosa je tu a on, debil, ešte dvere otvára... ', 531, 3.92, 1),
	(406, 'Išlo malé pivo po ceste a stretlo veľké pivo. A malé sa ho pýta: \r\n"Ahoj pivo, kami ideš?"\r\n"Ale do krčmy a ty?"\r\n"Ja sa idem dať dočapovať."', 152, 3.15, 1),
	(407, 'V noci vyjde opitý muž z krčmy a začne na plné ústa vykrikovať: "Ľudia, ľudia!!!" Na tento krik sa zobudí pol mesta. Muž začne vykrikovať opäť: "Ľudia, ľudia!!!" Celé mesto sa zobudilo a opitý muž pokračuje: "Čo nespíte??!"', 246, 3.25, 1),
	(408, 'Opitý kamarát ukazuje druhému opitému kamarátovi svoj byt.\r\n-Pozri a tu mám hovoriaci gong.\r\n-Neverím!\r\n-Tak pozri.\r\nPoriadne tresne do gongu a ozve sa:\r\n-Ktorý debil o tretej ráno trieska do gongu!!!', 209, 3.86, 1),
	(409, 'Syn prišiel večer domov v podnapitom stave. Dve verzie opisu tejto udalosti:\r\nHovorí syn:\r\n- Prišiel som okolo jedenástej večer domov, mal som trochu vypité, tak som otvoril dvere na WC, rozsvietil som, vygrcal som sa, zhasol som a išiel som späť.\r\nHovorí otec:\r\n- Sedím si tak okolo jedenástej večer na záchode, keď prišiel domov syn, totálne ožratý. Otvoril mi dvere, zhasol mi, ogrcal ma, zasvietil a išiel späť ...              ', 455, 4.04, 1),
	(410, 'Príde muž domov z krčmy, bez ruky a bez ucha. Žena sa ho zhrozene spýta: "Preboha, čo sa ti stalo?" Muž: "Ááále, stavil som sa s chalanmi o ucho, že mi neodtrhnú ruku."', 180, 3.72, 1),
	(411, 'Rozhovor v krčme:\r\n- Ja keby som bol prezidentom, tak by som prikázal, aby sa 365 dní v roku nepracovalo.\r\n- No tak ty asi nebudeš normálny. Veď to by sa muselo každý štvrtý rok jeden celý deň pracovať!', 215, 3, 1),
	(412, 'Dvaja horolezci sú do pol pása zavalení lavínou. Zrazu uvidia bernardína so súdkom rumu.\r\n"Aha, najlepší priateľ človeka!"\r\n"No áno, ale je priviazaný k tomu obrovskému bernardínovi."', 197, 3.6, 1),
	(413, 'Príde opilec o druhej ráno na sídlisko a kričí: "Ľudia!!!" Zobudila sa štvrtka sídliska, ale to chlapíkovi nestačí a tak zakričí opäť: "Ľudia, ľudiáááá!!!" Zobudí sa polovica sídliska, ale chlapíkovi to stále nestačí, a tak zakričí: "Ľudia, ľudiá, ľudiáááá!!! To sa už zobudilo celé sídlisko. V tom opilec pokračuje: "Čo nespíte?"               ', 388, 3.65, 1),
	(414, 'V Rusku pred startom raketoplánu čistí Serjoža s Voloďou loď od paliva handrami, keď v tom si Voloďa utrie pusu rukou, oblízne a hovorí kolegovi:\r\n"Ty, Serjožo,to je úplne ako rum - poď oblížeme to!"\r\nTak olížu celú raketu.\r\nVečer volá Voloďa Serjožovi:\r\n"Ty,Serjožo, si v poriadku?"\r\n"Áno, Voloďo, som."\r\n"A, Serjožko,neuprdol si si?"\r\n"Nie, Voloďo, neuprdol."\r\n"Tak si Serjožo ani neuprdni, ja som si uprdol a teraz ti volám z Tokia."', 465, 3.96, 1),
	(415, 'Po diaľnici jazdí jeden poriadne opitý muž a v tom ho zastaví policajt a hovorí  mu: "Pane, ved vy ste pili.""Nie ja som v živote nepil.""Ale áno, vy ste pili lebo ste uháňali 250-tkou."\r\n"Áno? Tak keď som teda pil, tak mi to dokátte."Policajt sa zasmeje a povie: "Dobre... Prejdite po tejto čiare, ktorú vám nakreslím." Opitý muž: "Dobre, ja po nej prejdem, ale vy tej čiare odkážte nech sa už konečne prestane hýbať."', 445, 3.13, 1),
	(416, '- Viete ako sa majä deti v Iraku?           \r\n- Bombovo.', 57, 3.72, 1),
	(417, 'Príde kostra do krčmy, buchne po stole a vraví:- Jedno pivo a handru!', 72, 3.35, 1),
	(418, 'V lese stretne zajac na motorke vlka a hovorí mu: "Ha, keby si neprepil všetky peniaze, tak aj ty máš takú motorku."Na druhý deň opäť ide zajac na peknom aute a stretne vlka. Hovorí mu: "Ha, keby si neprepil všetky peniaze, tak aj ty máš také auto." A na tretí deň uvidí zajac vlka na krásnom horskom bicykli. A zajac mu hovorí: "Vidíš, keď prestaneš piť, aj dačo máš." A vlk mu odpovie: "Ale, ja som neprestal piť, ja som len vrátil zálohové fľaše."', 483, 3.57, 1),
	(419, 'Viete prečo sa vodka volá vodka?Lebo je z malej vody.', 55, 2.38, 1),
	(420, 'Podnapitý muž príde neskoro v noci domov s kyticou kvetov.\r\nŽena nato: Ako sa to správaš!!! Si myslíš, že keď mi donesieš kvety, tak ti hneď rozkročím nohy?\r\nMuž odpovedá: Hmm, a čo ako.. nemáme vázu???', 221, 3.8, 1),
	(421, 'Je lepšie troška rozliať s Parkinsonom, ako zabudnúť vypiť s Alzhaimerom.', 79, 3.82, 1),
	(422, '- Mama mama ocino je znovu opitý!- Ako vieš?- Lebo zas v kúpeľni holí zrkadlo...', 85, 3.9, 1),
	(423, 'Príde Dezider do krčmy a hovorí: "Neuveríte čo sa mi stalo."\r\n"No čo?"\r\n"Idem po ulici a zrazu oproti mne traja. Každému som dal takú cez ústa, že im šlabikáre z aktoviek povypadávali."', 199, 4.03, 1),
	(424, 'Stretne Jano Joža a Jano sa chváli: "Ja som prestal piť!!!Jožo: "Jano neklam, veď včera si so mnou chľastal...Jano: "Ty sa tomu nerozumieš, Jožo... Ja som Abstin-ent!!!"', 178, 2.58, 1),
	(425, 'Murphyho zákon pitia.\r\nPiješ, pokiaľ môžeš. Môžeš, pokiaľ žiješ. Žiješ, pokiaľ piješ.\r\n', 103, 3.64, 1),
	(426, 'Viete prečo blondínky majú v chladničke prázdne fľaše? Pretože k nim chodí návšteva, ktorá nič nepije.', 115, 2.75, 1),
	(427, 'Nápis nad pisoármi:\r\n"Nehádžte špaky do pisoárov. Rukou, ktorou ich vyberám vám čapujem pivo a naberám jedlo."', 120, 3.8, 1),
	(428, 'Príde Jano do krčmy a vraví: "Predstav si, prestal som piť."\r\nJuro na to: "Tak to musíme osláviť. Hej čašníčka, dones nám pol deci." ', 145, 3.65, 1),
	(429, '- Aký je rozdiel medzi ženou a slivovicou?\r\n- Žiadny.\r\n- Čím je staršia, tým je z nej väčšia opica.', 109, 3.91, 1),
	(430, 'Ide policajt po diaľnici v protismere, zapne si rádio a počúva: "Po diaľnici ide šofér v protismere" a policajt hovorí: "Jak že jeden, však idú všetci.."', 165, 3.89, 1),
	(431, 'Abstinenti sú ľudia čo pijú tajne.', 38, 3.63, 1),
	(432, 'Ide opitý po prechode, drží fľašu a zrazí ho auto. Začne cítiť, že mu ničo steká po nohách a hovorí si: "Dúfam, že to nie je rum."', 146, 3.21, 1),
	(433, 'Ide opitý muž večer po cintoríne a spadne do otvoreného hrobu. Po chvíľke mu je už strašná zima, a tak začne z plného hrdla kričať: "Pomoc, vytiahnite ma, je mi strašná zima."Po chvíľke ide tadiaľ druhý opilec a začuje ho. Podíde bližšie a vraví: "Na čo si sa odkopával, keď teraz mrzneš?"', 318, 3.81, 1),
	(434, 'ALKOHOL ti nedá odpoveď... ale aspoň zabudneš na otázku...', 63, 3.5, 1),
	(435, 'Dvaja opilci cikajú pri stene a jeden hovorí druhému:\r\n- Ty nečúraš? Lebo dajako nepočuť.\r\n- Čúram, čúram, ale na nohavice.\r\n- A nie je škoda tých nohavíc?\r\n- A čo mňa po tvojich nohaviciach?', 208, 3.87, 1),
	(436, 'Kto druhemu jamu kope, zarobí, a potom slope...............', 60, 3.27, 1),
	(437, 'Ten čo pije umrie skôr. Ten kto nepije umrie ešte skôr. Pretože ten, ktorý pije zrazí toho čo nepije.', 109, 3.03, 1),
	(438, 'Nie je všetko zlato čo sa blyští,\r\nnie je všetko koňak čo kôň vyští.', 79, 4.2, 1),
	(439, '- Ako sa vyberajú Číňanom mená?- Hodíš plechovku zo schodov...                                                            ', 129, 3.31, 1),
	(440, 'Jožo prečo chlastáš?\r\nPretože alkohol je pes a pes je najlepší priateľ človeka.', 88, 3.65, 1),
	(441, 'Rus, Američan a Slovak sa hádajú kto z nich má najtvrdší chlast. Dohodnú sa, že si dajú pred seba stoličku a vyhrá ten kto ich uvidí viac.Napije sa Rus vidí 4 stoličky, napije sa Američan a vidí 6 stoličiek, napije sa Slovák a Rus s Američanom sa ho pýtajú: "Tak koľko stoličiek vidíš?"A Slovák na to: "V ktorom rade myslíte??"', 354, 4.18, 1),
	(442, 'Príde opitý muž domou a žena sa ho pýta: "Budeš ešte piť?"\r\nMuž neodpovedá, tak mu žena dá facku. Znova sa ho pýta: "Budeš ešte piť?"\r\nMuž zase neodpovedá, tak mu žena dá zase facku. "Tak čo, budeš ešte piť?"A muž na to: "Tak nalej, no."', 262, 4.21, 1),
	(443, 'Keď sa budeš v noci báť, \rskús si niečo pekné zaželať. \rTvoj anjelik o tom zvie, \rfľašku vodky prinesie. \rDá si glg a príde slina, \rspiješ sa jak divá sviňa! ', 174, 3.56, 1),
	(444, 'Príde čudne vyzerajuci pán do zelovocu a pýta sa predavačky:\r\n- Toto je čo ?\r\nPredavačka odpovedá: - Jablká.\r\n- Tak mi zabeľte 10 kg a každé zvlášť.\r\nTak predavačka balí a opilec sa pýta:\r\n- A toto je čo ?\r\n- Banány.\r\n- Tak mi zabaľte 10 kg a každý zvlášť.\r\nTak teda predavačka balí a opilac sa znova pýta:\r\n-Toto je čo ?\r\nA predavačka kričí: - Tak na to ani nepozerajte, to je mak!', 415, 4.25, 1),
	(445, 'Príde muž do krčmy a hovorí: Som smädný. Krčmár nato: A čo si dáte? \r\nMuž hovorí: Čistú vodu. \r\nKrčmár nato: My sme slušná krčma, my čistú vodu nemáme.', 173, 3.55, 1),
	(446, 'Učitelka zadala svým žákům 8.A třídny úkol: Zjistit od rodičů příběh s ponaučením na konci. Druhý den ve škole děti vyprávějí své historky.\r\nKatka říká: "Můj tatínek je farmář a chová slepice kvůli vejcím. Jednou jsme je v košíku vezli do obchodu na předním sedadle, když v tom jsme nabourali, košík vyletěl a vajíčka se rozbila."\r\n"A ponaučení?" ptá se učitelka.\r\n"Nedávej všechna vejce do jednoho košíku."\r\n"Dobře", říká učitelka, "teď Lucka."\r\n"Naše rodina má taky farmu. Ale chováme slepice kvůli masu. Měli jsme jednou tucet vajec, ale vylíhlo se nám jen 10 kuřat. A ponaučení je: Nepočítejte slepice, dokud se nevylíhnou."\r\n"To je pěkný příběh", říká učitelka. "Pepíčku, jaký máš příběh ty?"\r\n"Ano paní učitelko, můj tatínek mi řekl příběh o strýčkovi Liborovi. Strýček Libor byl s paragány v Kosovu a jeho vrtulník to jednou dostal. Musel nouzově přistát na nepřátelském území a jediné co měl byla láhev Slivovice, kulomet a mačeta. Než dopadl na zem, vypil lahev Slivovice, aby se nerozbila a pak přistál přímo mezi stovkou povstalců. Zabil jich 70 kulometem než mu došly náboje. Potom zabil dalších 20 mačetou, než se mu zlomila čepel a zbytek zabil holýma rukama."\r\n"Svatá dobroto", zděsí se učitelka, "a jaké ponaučení ti tatínek řekl z tohoto hrůzného příběhu?"\r\n"Neser strejdu Libora, když je nalitej."', 1457, 4.29, 1),
	(447, 'Najobľúbenejšie nápoje:\r\nv Amerike - Coca cola\r\nv Anglicku - Pepsi cola\r\nv Nemecku - Afri cola\r\nv Rusku - nalej vodky, Koľa\r\nna Slovensku – slivovica do o-cola', 166, 4.1, 1),
	(448, 'Vracia sa úplne opitý chlapík domov, vyberie kľúče a odomyká byt. Zrazu vybehne majiteľ bytu a hovorí:\r\n"Sused, prosím vás, veď vy bývate o poschodie vyššie."\r\nChlapík sa pomotá po dome, hľadá svoj byt, ale o chvíľu už znova stojí pri tých istých dverách. Znova vybehne sused a vysvetľuje mu, že býva o poschodie vyššie. Na tretíkrát sa už napitý chlapík nezdrží a hovorí susedovi:\r\n"No, hlavne, že ty bývaš všade!"', 458, 4.27, 1),
	(449, 'Kto druhému jamu kope, zarobí a potom slope.', 46, 3.78, 1),
	(450, 'Správny pirát z karibiku, pije rum.\r\nSprávny pirát ciest zo Slovenska, pije slivovicu.', 90, 3.03, 1),
	(451, 'Mužský hlas volá požiarnikom: \r\n- Horí mi dom! Horí mi dom!\r\nPožiarnik hovorí: \r\n- Dobre, dobre, hneď tam budeme. A ako sa tam dostaneme?\r\nMuž trochu zmätene povie: \r\n- Už nemáte tie veľké červené autá?', 220, 3.59, 2),
	(452, 'Nič tak neuškodí autu, ako keď si sused kúpi nové.', 56, 3.22, 2),
	(453, 'Skúška v autoškole. Riešia sa križovatky. Inšpektor sa pýta:\r\n- Tu je križovatka, tu ste vy, tu autobus, tu nákladné auto a tu motorka. Kto pôjde prvý?\r\n- Taxikár - odpovedá adept motorizmu.\r\n- Prečo taxikár? Kde by sa tu vzal taxikár?\r\n- Kristushovie, odkiaľ sa tí taxikári berú...', 303, 2.89, 2),
	(454, 'Príde trpaslík na benzínku:\r\n"Prosím si kvapku benzínu a dve kvapky oleja." \r\nPredavač mu odpovedá: \r\n"A prdnúť do pneumatík by si nepotreboval?"', 155, 3.59, 2),
	(455, 'Spotený vodič dotlačí trabanta na čerpaciu stanicu a pýta si 2 litre benzínu.\r\nPumpár sa pýta: \r\n"Na naštartovanie?"\r\n"Nie, na podpálenie!"', 150, 3.49, 2),
	(457, '"Narazil som do stromu", priznáva sa vodič auta v autoopravovni.\r\nAutomechanik prejde okolo auta a pýta sa:\r\n"Koľkokrát?"', 126, 3.34, 2),
	(458, 'Idú dve dievčatá so super postavou po chodníku. Nesú sa ako modelky, jedna krajšia od druhej. Zo zadu prichádza po ceste auto. V ňom dvaja mladíci a spolujazdec vraví šoférovi:\r\n- Zatrúb na ne, nech sa otočia.\r\nŠofér len zapne stierače, ale nezatrúbi. Takto prejdú okolo nich, dievčatá miznú v diaľke a spolujazdec vyčíta šoférovi:\r\n- Prečo si na ne nezatrúbil, mohli sme ich odviesť, a kto vie čo všetko by bolo. A ty si sa hral so stieračmi!\r\n- Sorry, ale trúba mi nefunguje, tak som na ne zakýval.', 535, 2.81, 2),
	(459, 'V Amerike zastaví na križovatke parádne Ferrari a vedľa neho slovenská embéčka. Z Ferrari vykukne chlapík a hovorí:\r\n- Dobré! To si si robil sám?', 156, 3.18, 2),
	(460, 'Chlap príde do lekárne a vraví:\r\n"Prosím si 500 metrov náplaste."\r\n"A načo vám sú?"\r\n"Aaale, rozbil som trabanta...."\r\n"Na trabanta stačí 200."', 153, 3.23, 2),
	(461, 'Kamión príde k tunelu. Niekoľko metrov pred ním stojí dopravná značka označujúca maximálnu výšku tri metre. Vodič zastaví, veď jeho kamión je vyšší ako tri metre. Požiada závozníka, aby sa pozrel, čo sa dá robiť. Závozník sa o niekoľko minút vráti a povie:\r\n- Čistý vzduch! Policajti nikde! Štartuj!', 332, 2.92, 2),
	(462, 'Zrýchlenie áut z 0 na 100 km/h:\r\nRenault clio - 12 sekúnd.\r\nPorsche - 4 sekundy.\r\nFerrari - 3,5 sekundy.\r\nTrabant - NIKDY.', 125, 3.19, 2),
	(463, 'Viete, prečo je výhoda chodiť s blondínou v aute?\r\nLebo môžete parkovať aj na miestach vyhradených pre postihnutých!', 125, 3.11, 2),
	(464, 'Prečo ide trabant 80km/h?\r\nLebo by ho roztrhali psi.', 53, 3.24, 2),
	(465, 'Ako spoznáš veselého motorkára?\r\nMedzi zubami má mušky.', 61, 3.64, 2),
	(466, 'Američan si obzerá trabant a konštatuje:\r\n- Hmm... v dnešnej dobe sa dá z lega hocičo urobiť.', 100, 3.75, 2),
	(467, 'Aka je maximálna rýchlosť? \r\nKeď má slimák ABS a flekuje do zákruty.', 75, 3.64, 2),
	(468, 'Čo je najväčším snom majiteľa trabantu? Dostať pokutu za prekročenú rýchlosť.', 88, 3.34, 2),
	(469, 'Pani si sadne do auta, zaradí rýchlosť a narazí do auta pred sebou. Zaradí spiatočku a narazí do auta za sebou. Príde policajt a pýta sa:\r\n- Pani vodička, chcete s tým autom odísť, alebo trénujete biliard?', 219, 3.32, 2),
	(470, 'Auto patriace autoškole zastaví na pumpe. Vyjde z neho slečna a chce tankovať.\r\n- Preboha, vypnite motor! - kričí na ňu pumpár.\r\n- To nie je motor! To sa od strachu klepe môj inštruktor.', 196, 2.82, 2),
	(471, '- Tak ako sa ti podarili skúšky v autoškole.\r\n- Ešte neviem. Keď ma pustili z nemocnice, inštruktor bol ešte v bezvedomí.', 129, 3.34, 2),
	(472, 'Muž príde na parkovisko k svojmu zaparkovanému autu a vidí, že blatník je poškodený. Za stieračom nájde oznam:\r\n- Pane, to ja som poškodil vaše auto. Tu okolo mňa stojí asi 15 zvedavých chodcov a myslia si, že na tento papier píšem svoje údaje.', 263, 3.16, 2),
	(473, '- Vážení cestujúci! Pristátie, kvôli ochoreniu pilota, sa neuskutoční.', 78, 3.25, 2),
	(474, 'Ide chlap v džípe po púšti a zrazu mu auto skape. Chlap vylezie a otvorí kapotu. Chvíľu čumí dovnútra, ale nevie, čo s tým.  Zrazu sa znenazdania vedľa neho objaví biely kôň, strčí hlavu pod kapotu, zaerdží a auto je opravené. Chlap chvíľu vyvaľuje oči a keď kôň zmizne, naskočí do auta a ide ďalej. Príde do oázy, vyskočí z auta a vyrozpráva svoj zážitok Arabom okolo. Keď to dopovie, jeden Arab mu vraví:\r\n- Tak to ste mali celkom šťastie. Ešte tu behá taký hnedý, ale ten autám vôbec nerozumie.', 545, 3.36, 2),
	(475, 'Čo sa stane, keď sa zrazí kamión s trabantom?\r\nNič, kamión ide ďalej.', 76, 3.06, 2),
	(476, 'Na križovatke vedľa seba zastanú milionár na Porsche a Trabanťák. Naskočí zelená, obaja pridajú plyn a trabant zmizne milionárovi z dohľadu. Tak sa naštve a kúpi si Ferrari.\r\nZnova tá istá situácia na križovatke, naskočí zelená a trabant sa opäť stratí z dohľadu. Milionára to už tak naštvalo, že si kúpil Lamborgini Diablo. A opäť sa stretol s tým istým Trabantom na križovatke. Naskočí zelená, obaja vyrazia a idú hodnú chvíľu vedľa seba. Po chvíli stiahnu okienka a milionár sa uškŕňa na trabanťáka:\r\n- A čo spravíš teraz, frajer?\r\n- Zaradím dvojku.', 606, 3.94, 2),
	(477, 'Colník sa pýta vodiča:\r\n- Nejaké cigarety, alkohol, drogy? \r\n- Nie, ďakujem, mám svoje.', 93, 3.64, 2),
	(478, 'Podnikateľ zastavil svoje nové BMW na chodníku pred svojim úradom. Samozrejme, nepozrie sa na cestu, otvorí dvere dokoran... Akurát ide okolo Tatrovka a dvere mu urve. Podnikateľ celý naštvaný kričí: \r\n- Ty blbec, kde máš oči, pozri, čo si mi spravil s mojim novým autom!\r\nTatrovkár sa naňho pozrie a diví sa:\r\n- To, že nemáš dvere ti vadí, ale to, že ti odtrhlo tri prsty, to si si ani nevšimol?\r\n- Preboha! Kde je môj mobil?', 453, 3.58, 2),
	(479, 'Na traktore sedí ujo, preháňa sa rezko, zrazu sa mu strhol volant, do kríkov ho pleslo.', 91, 3.13, 2),
	(480, 'Auto prechádza úsekom husto zaplneným dopravnými značkami a zrazu ho zastaví skupina policajtov v slávnostných uniformách:\r\n- Pán vodič, práve ste úspešne absolvovali nás skúšobný úsek. Získali ste prémiu päťtisíc korún.\r\n- Zo srdca vám ďakujem, ale keby som mal vodičák, to by ste niečo videli!\r\nVedľa sediaca žena sa snaží zachrániť situáciu:\r\n- Neverte mu, vždy tára, keď si trochu vypije!\r\nKeď svokra na zadnom sedadle zbadá mračiace sa tváre policajtov, mravokárne káže:\r\n- Ja som vám vravela, aby ste nechodili s ukradnutým autom do mesta!', 594, 3.56, 2),
	(481, 'Lístoček za stieračom zaparkovaného auta: \r\n"Oznam pre zlodejov. Nádrž je prázdna, rádio nemám a motor je vylágrovaný."\r\nNa druhý deň pribudne druhý lístoček: \r\n"Pre majiteľa auta. Takže kolesá sú ti vlastne tiež nahovno."', 243, 3.38, 2),
	(482, '- Narazil som do stromu - priznal sa vodič v autoservise.\r\nAutomechanik prejde okolo auta a pýta sa:\r\n- A koľko krát?', 121, 2.92, 2),
	(483, 'Dotlačí unavený chlapík auto na benzínku a hovorí:\r\n- Prosím si dva litre benzínu.\r\nA benzínmajster sa milo pýta:\r\n- Na natankovanie?\r\n- Nie, na podpálenie, ty chmuľo!', 179, 3.07, 2),
	(484, 'Stretne sa zeleninár, zmrzlinár a gynekológ a rozprávajú si, kto má aké auto. Zeleninár hovorí \r\n- Tu bečka, tam bečka, v mojom dvore stojí embéčka! \r\nZmrzlinár hovorí:\r\n- Tu zmrzlina, tam zmrzlina, v mojom dvore stojí audina!\r\nGynekológ sa zamyslí a povie:\r\n- A ja mám moskviča!', 300, 3.46, 2),
	(485, 'Príde nemec na slovenskú benzínku, vytiahne tankovaciu pištol zo stojanu a pichne si ju do zadku. Pumpár sa tak chvíľu naňho pozerá a potom pribehne k nemu a zareve naňho:\r\n- Das is normal ?! \r\nA poklepe si po čele.\r\nNemec na to :\r\n- Nein, das is super!', 264, 3.42, 2),
	(486, 'Idú dve autá za sebou. Audi prvé a za ním škodovka. Na semafóroch zasvieti červená. Šofér na Audine len tak tak zastane. Škodovka to samozrejme nestihla a pokrčila Audine zadok. Obaja šoféri vyšli von z áut. Šofér škodovky vraví tomu druhému:\r\n- No vidíš. Na hovno ti je ABS, keď ja nemám!', 314, 2.86, 2),
	(488, 'Stretnú sa dve Tatrovky v úzkej uličke.\r\n- Cúvaj,  - zavrčí jeden z tatrovkárov - lebo urobím to isté, čo som urobil minule.\r\nDruhý pre istotu zaradí spiatočku a vycúva. Potom mu to predsa nedá a pýta sa prvého tatrovkára:\r\n- Počuj, a čo si to vlastne minule urobil?\r\n- Vycúval som.', 303, 3.33, 2),
	(489, 'Viete ako zdvojnásobite cenu svojeho auta?\r\nDotankujte ho doplna.', 66, 3.18, 2),
	(490, 'Zastaví embéčka na Broadwayi, chlapík z nej vystúpi a ešte než zamkne, pristúpi k nemu Američan, ktorý si auto dlhšie zvedavo obzeral a hovorí: \r\n- Pekné, veľmi pekné. To ste robil sám, alebo vám niekto pomáhal?', 229, 3.08, 2),
	(491, 'Chlapík nasadá do taxíka a vodič mu vraví:\r\n- Ukážte mi, prosím dlaň pravej ruky! Mám zlé brzdy a beriem len ľudí s dlhou čiarou života.', 151, 3.3, 2),
	(493, 'Vodič na benzínke: \r\n- Prosím si novú paličku na meranie množstva oleja. Tá stará mi už na olej nedosiahne.', 116, 3.26, 2),
	(494, 'Viete prečo Rus musí kradnúť auto z Nemecka dva krát?\r\nRaz v Nemecku a ešte raz v Polsku.', 95, 3.26, 2),
	(495, 'Tatrovkár telefonuje predákovi na stavbe:\r\n"Šéfe, potrebujem vymeniť spetné zrkadlo!"\r\n"No tak ho vymente."\r\n"Nemôžem, leží na ňom Tatrovka."', 152, 3.29, 2),
	(496, 'Vodič nabúra do auta zaparkovaného na parkovisku. Vystúpi zo svojho auta, pristúpi k tomu, do ktorého práve nabúral a začne písať odkaz: “Keď píšem tento lístok, sleduje ma asi tucet ľudí. Všetci si myslia, že píšem svoje meno, adresu a číslo poistky. Ale nepíšem.” ', 295, 3.27, 2),
	(497, 'Muž vychádza z taxíka a taxikár mu hovorí:\r\n- Tak pane, je to za 200 korún.\r\n- Čo si pako? Tu máš stovku, ty si sa viezol tiež.', 137, 3.35, 2),
	(498, 'Pacient, celý v sadre, sa s vypätím síl pýta zdravotnej sestry:\r\n- Sestrička, neviete, či som ten vodičák urobil?', 122, 3.13, 2),
	(499, 'Tatrovkár zastavil v motoreste, objednal si obložené rožky, kávičku a sadol si za stôl. Ledva sa pustil do jedenia, prišli dnu dvaja motorkári na Harleyoch, prisadli si k nemu a všetko mu zjedli a vypili. Tatrovkár sa pokojne zdvihol, zaplatil a vyšiel von. Motorkári sa na seba chvíľu dívajú a hovoria si: \r\n- No, tak toto bol nejaký sraľo, že sa mu ani biť nechcelo...\r\nČašník ich počul a hovorí: \r\n- Veru. Aj mne sa zdal nejaký divný. A navyše ani jazdiť nevie, lebo pred chvíľou pred vchodom precúval dve motorky!', 550, 3.33, 2),
	(500, 'Opilec zavolal na policii, že mu vykradli auto:\r\n"Člověče, ukradli mi přístrojovou desku, volant, brzdu, plyn, dokonce i řadící páku!"\r\nNež stihli policajti začít něco dělat, zazvonil telefon znovu:\r\n"Ech, kašlete na to, omylem jsem vlezl na zadní sedadlo."', 274, 3.36, 2),
	(501, 'Po cete idú dve autá oproti sebe. V jednom sedí žena a v druhom muž. Autá sa zrazia. Z jedného vystúpi nazúrený chlap a pýta sa:\r\n- Ženská, vy ste nikdy nerobili vodičák?\r\nZ druhého auta vystúpi nazúrená žena a kričí:\r\n- Tak určite viac krát ako vy!', 273, 2.96, 2),
	(502, 'Inzerát:\r\nPredám celoročnú dialničnú nálepku na rok 2004. Málo jazdená, ako nová, treba vidieť. Pri rýchlom jednaní zľava. Zn.:Dohoda istá.', 154, 3.02, 2),
	(503, 'Ako zastaví indián 12 tonový kamión?\r\nStúpi na brzdu!', 58, 2.95, 2),
	(504, 'Slogan ukrainskej cestovnej kancelárie:\r\n"Prídte, navštívte našu krásnu krajinu, Vaše auto je už tu."', 109, 3.35, 2),
	(505, 'Podľa najnovšej vyhlášky o cestnej premávke:\r\nŽena môže pridávať plyn iba doma na sporáku!', 101, 3.31, 2),
	(506, 'Vodič na benzínovej pumpe:\r\n"Prosím si novú paličku na meranie množstva oleja. Tá stará mi už na olej nedotiahne."', 123, 3.09, 2),
	(507, '- Kedy si mal tú nehodu s motocyklom?\r\n- Akú nehodu?\r\n- To mi ani nevrav, že si sa s takým ksichtom narodil!', 112, 3.54, 2),
	(508, 'Predák chodí po stavbe a zbadá tatrovkára, ako spí opretý o koleso v tieni svojej Tatrovky. Naštve sa a zreve:\r\n"Človece, za toto ste platený?"\r\nRozospatý tatrovkár vytreští oči:\r\n"Čože, za toto dostanem osobitný príplatok?"', 242, 3.11, 2),
	(509, 'Tatrovkár zdedil klavír. Chvíľu si ho obzerá a hovorí:\r\n"No, dva pedále. Plyn a brzda. Spojka bude asi automatická."', 124, 3.13, 2),
	(510, 'Tatrovkár zobral stopárku. Predvádza sa pred ňou, ženie tatrovku ako diabol po cestách - necestách.\r\n"Pán vodič, to sa nebojíte jazdiť tak rýchlo po takej mizernej ceste takou šialenou rýchlosťou?"\r\n"Žiadne strachy", odpovie tatrovkár, "poznám tu každú jamu!"\r\nVtom sa vozidlo otriaslo a už aj letí do priekopy. Tatrovkár stačí ešte zvolať:\r\n"Vidíte, toto je jedna z nich!"', 401, 3.38, 2),
	(511, 'Žena v autoservise:\r\n"To auto nejako moc žerie."\r\n"Bodaj by nie, keď máte vytiahnutý sýtič."\r\n"Aký sýtič? To nie je vešiačik na kabelku?"', 149, 3.05, 2),
	(512, 'V noci volá chlapík na políciu.\r\n- Vykradli mi auto. Ukradli mi rádio, volant, prístrojovku. Príďte mi to spísať, prosím.\r\nPolícia príde k autu, nazrie dnu a policajt hovorí:\r\n- Však to tu všetko máte.\r\nA chlapík na to:\r\n- Jaj, ja som zaspal na zadnom sedadle!', 277, 3.03, 2),
	(513, '- Oci, prečo nemôžem riadiť naše auto? Veď som už dosť starý!\r\n- Ty áno, ale naše auto nie!', 102, 3.15, 2),
	(514, 'Jeden konečne dostal vodičský preukaz, tak pozval dvoch priateľov, že ich povozí. Po chvíli divokej jazdy ho jeden požiadal, aby zastavil, a vystúpil. Druhý to tiež dlho nevydržal a vystúpil. Tak pokračoval sám a pri rozbiehaní kričal za kamarátmi:\r\n"Vy ste ale poserovia! Nemôže sa nič stať, lebo môj anjel strážny to \r\nnedopustí."\r\nA keď nabral rýchlosť, cíti, ako niekto zozadu klepe po pleci:\r\n"To som ja, tvoj anjel strážny. Zastav, prosím ťa, tiež si radšej vystúpim."', 511, 3.61, 2),
	(515, 'Policajt zastaví auto a pustí sa do jeho technickej kontroly. Prikáže vodičovi otvoriť kapotu a ukazuje na rôzne súčiastky:\r\n- Čo je toto? \r\n- Sviečka.\r\n- A toto?\r\n- Sviečka.\r\n- A toto?\r\n- Sviečka.\r\nPolicajt sa nahnevá a vykríkne: \r\n- Tak čo je toto auto, alebo pojazdný betlehem?', 297, 3.22, 2),
	(516, 'Smädom a hladom vyčerpaný nomád sa plazí po púšti a už si myslí, že je s ním koniec, keď tu zrazu uvidí, ako sa k nemu blíži kamión. Z posledných síl vstane a začne naňho mávať. Kamión zastaví, otvoria sa dvere a z vnútra sa ozve:\r\n- Dobrý den, jmenuji se Karel Loprais, děkuji, že nám fandíte, ale stopaře bohužel neberem. Zatím naschle.', 371, 2.88, 2),
	(517, 'Inštruktor v autoškole hovorí budúcej vodičke:\r\n- Slečna, nie že by mi to vadilo, ale hovoril som cúvať, nie cmúľať!\r\nPo skončení jazdy na posteli hovorí slečna učiteľovi:\r\n- Nie že by mi to vadilo, ale hovorila som lízať, nie zízať!', 256, 3.08, 2),
	(518, '- Pán vodič, vodičský preukaz si prosím!\r\n- Viete čo, spravte si medzi sebou poriadok. Včera ste mi jeden zobrali a dnes už pýtate ďalší!', 149, 2.99, 2),
	(519, 'Muž si ženie svoje nové auto a čo by čert nechcel, napáli to do neho zo zadu ženská. Muž vystúpi a vraví:\r\n- Čo nevidíš ty sliepka jedna!\r\nŽena tak nesmelo vystrčí hlavu z otvoreného okienka a odpovedá:\r\n- Ko, ko, komu tykáš...', 248, 4.18, 2),
	(520, 'Vieš, čo má napísané motorkár na chrbte?\r\n"Keď čítaš tieto riadky, stratil som priateľku."', 101, 3.2, 2),
	(521, 'Ruský obchodník, obchodujúci vo Švajčiarsku príde do tamojšej  banky s požiadavkou požičania peňazí peňazí na 1 rok. \r\n- Musím vás upozorniť , pane, že banka za to berie 3 percentá a majetok do zálohy...\r\n- Súhlasím. Do zálohy dávam môj nový Mercedes a požičiavam si - sto dolárov...\r\nÚradník sa zadivil, no Švajčiaske banky si vážia klienta a tak bez slova pôžičku vybavili.\r\nO rok príde  Rus do banky, vráti stovku s 3 dolármi  úrokov, vezme Mercedes a chce odísť. Úradník nevydrží a spýta sa :\r\n- Prepáčte, pane, u nás si ľudia z celého sveta zvyknú požičiavať milióny dolárov!.... povedzte, načo vám bolo 100 dolárov ???\r\n- Nanič! ...Viete -  bol som rok doma -  v Rusku -  a kde by som tu našiel  za 3 doláre na rok tak vynikajúce, strážené parkovisko pre môj Mercedes...???.....', 855, 3.7, 2),
	(522, 'Viete prečo musí ísť trabant rýchlo cez dedinu???\r\nAby ho neroztrhali psi.', 79, 3.19, 2),
	(523, 'Policajt zbadá na okraji cesty pri lesíku odparkované auto. Vystúpi, prejde pár krokov a kričí: \r\n- Je tu majiteľ auta BA001AA? \r\n- Áno tu som!\r\n- A papiere máte?\r\n- Nie, mne stačí aj lopúch!', 204, 3.07, 2),
	(524, 'Zastaví policajt vodiča a hovorí:\r\n"Prosím si 500 Sk!"\r\n"A kedy mi ich vrátite?"', 85, 3.34, 2),
	(525, 'Na križovatke zastane limuzína a trabant vedľa seba. Chlapík z trabanta stiahne okienko a kričí na šoféra v limuzíne. \r\n- Ja tu mám aj rádio. \r\nTen z limuzíny hovorí, že on tiež. Ten s trabanta, že on má aj chladničku, televízor s videom. Ten z limuzíne, že u neho je to normálne, že má aj telefón s faxom, bar aj s alkoholom. No a ten s trabantu hovorí, že má aj posteľ. Vtedy sa rozsvieti zelená a chlapík s limuzínou urazený ujde a ide rovno do predajne, kde kúpil auto, že prečo nemá posteľ. Tak mu ju namontujú a on ide rovno hľadať toho s trabantom, že sa mu pochváli. Nájde ho na parkovisku, zatiahnuté záclonky, tak mu búcha na okienko. Ten z trabanta otvorí a pozerá na neho, že čo chce. Ten z limuzíny hovorí, že už aj on má posteľ, dokonca vodnú. No a chlapík s trabanta sa na neho pozrie a hovorí. \r\n- A to si ma musel kvôli tomu vytiahnuť z vane?', 921, 3.63, 2),
	(526, 'Viete o tom, že na Trabanty montujú dva výfuky!? Keď sa pokazí, tlačíte ho ako fúrik !!!', 96, 3.21, 2),
	(527, 'Idem si autom po ulici, keď mi do cesty vošiel chlap s bielou paličkou. Robil sa, že ma nevidí, tak som ho prešiel, frajera.', 130, 2.99, 2),
	(528, 'Príde škriatok na benzínovú pumpu a pýta si 2 kvapky benzínu a 1 kvapku oleja. Pumpár sa naňho pozrie a pýta:\r\n- A prdnúť do duše by si nechcel?', 156, 2.78, 2),
	(529, 'Podľa novej vyhlášky je zakázané v Trabante používať bezpečtnostné pásy. \r\nDôvod: Keď sa v Tatrách pri vystupovaní z auta zabudnete odpásať, nosíte to celý čas ako batoh.', 190, 3.34, 2),
	(530, '- Poznáte ten vtip o traktore? Ani ja, lebo som bol na vlečke.', 64, 2.91, 2),
	(531, '- Včera som inštruktorovi v autoškole prešla cez rozum.\r\n- Ako?\r\n- Zadným kolesom.              ', 101, 3.8, 2),
	(532, 'Chlapík v novom volve XC90 T6 vo full-výbave nadupaný elektronikou zastane na červenú na križovatke. Stojí, čaká na zelenú, už ide oranžová, keď tu zrazu DZIIIIIIIIIIIIIGGGGGG!!!! Zozadu sa do neho nabúra trabant.\r\nS volvom to len mierne kývne, chvíľku sa nič nedeje\r\na potom sa chlapíkovi na palubnom počítači objaví hláška:\r\n"Bol zistený nový hardware! Chcete nainštalovať ovládač?"              ', 430, 4.08, 2),
	(533, 'Dvaja pod parou sedia v aute.\r\n"Už sme v meste?" pýta sa jeden druhého.\r\n"Myslím, že áno, lebo zrážame stále viac chodcov...!"\r\n"Prepánajána! Tak spomaľ!"\r\n"Ako môžem spomaliť, človeče! Veď riadiš ty!"              ', 234, 3.8, 2),
	(534, 'Stopuje Smrtka pri ceste a po chvíli jej zastaví okoloidúci šofér:\r\n- Tetka, kam to bude?\r\n- Ale, len kúsok, tam na tú zákrutu.              ', 149, 4, 2),
	(535, 'Prečo havarujú opití vodiči?\r\nLebo netrénujú opití!              ', 72, 3.94, 2),
	(536, 'Zrazia sa dve autá. Šofér z jedného vystúpi a vidí, že sa zrazil so šoférkou. Kričí na ňu:\r\n"Baba jedna bláznivá! Robila si ty niekedy vodičák?!"\r\n"Určite viackrát než vy!"  nedá sa mladá dáma.              ', 229, 3.67, 2),
	(537, 'Ide chlapík v aute a v tom ho predbehne trabant! kúpi si rýchlejšia auto-ferari- a zase ho predbehne ten istý trabant!! tak si kúpi formulu, ide už riadnych 300km,ide vedľa trabantu a pýta sa vodiča: ,,a čo urobíš teraz?!"\r\nvodič odpovedá: ,,zaradím dvojku!!"              ', 289, 3.71, 2),
	(538, 'Cigán si robí autoškolu. Prejde v poriadku križovatkou a inštruktor sa ho pýta: "Len tak pre zaujímavosť, čo to tam bolo za značku?" A Cigán na to: "Hliníková, vrátime sa?"              ', 200, 4.08, 2),
	(539, 'Stretnú sa dve dušičky v nebi:\n- Aké posledné slová ťa sem vyprevádzali?\n- Boli od mojej ženy. Vravela, že\nkeď ju aspoň chvíľu nechám šoférovať, budem anjel.              ', 189, 3.86, 2),
	(540, 'Policajti udeľujú odmeny za dobrú jazdu. Zastavia auto a hovoria:\n-Blahoželáme! Vyhrali ste 10 000 za vzornú jazdu!\nVodič: \n-Super! už desať rokov si chcem urobiť vodičák.\nSpolujazdec:\nNepočúvajte ho. Keď si vypije, nevie čo hovorí.\nBabka vzadu:\n-Ja som vravela že nemáme ísť ukradnutým autom.\nA z kufru sa ozve:\n-Už sme za hranicami?              ', 371, 2.61, 2),
	(541, 'Policajt zastaví mladú šoférku auta:\r\n”Neviete, čo znamená táto dopravná značka?”\r\n”Neviem, ale spýtajte sa tamtoho ujka, on vie všetko.”              ', 170, 3.75, 2),
	(542, 'V Amerike zastaví na križovatke parádne Ferrari a vedľa neho slovenská embéčka. Z Ferrari vykukne chlapík a hovorí:\r\n"Dobré!\r\nTo si si robil sám?"              ', 171, 4, 2),
	(543, '"Jano, vyzeráš hrozne. Čo je s tebou? Nebol si tento rok na dovolenke?"\r\n"Ale bol..."\r\n"A kde si ju strávil?"\r\n"Dva dni v aute na dne priepasti a potom dva mesiace v nemocnici."              ', 195, 3.88, 2),
	(544, 'Policajt zastaví auto so zjavne opitým vodičom a prikáže mu fúknuť. Chlapík odmieta a vysvetľuje:\r\n”Som silný astmatik a preto nemôžem poriadne fúknuť.”\r\nPolicajt mu chce teda odobrať vzorku krvi, ale chlapík zase odmieta:\r\n"Nemôžem, som hemofilik a neprestal by som krvácať.”\r\nPolicajtovi to už lezie na nervy a chce, aby chlapík vystúpil a prešiel po rovnej čiare, ale chlapík zase odmieta.\r\n”Prečo nie?” pýta sa policajt.\r\nA chlapík na to:\r\n”Pretože som na to moc opitý.”              ', 533, 4.18, 2),
	(545, 'Chlapík nasadá do taxíka a vodič mu vraví:\r\n”Ukážte mi, prosím, dlaň ľavej ruky! Mám zlé brzdy a beriem len ľudí s dlhou čiarou života.”              ', 170, 4.17, 2),
	(546, 'Viete, ako sa hovorí škodovke na vrchu kopca?\r\nZázrak.              ', 71, 3.88, 2),
	(547, 'Šéfovi nákladnej dopravy zvoní telefón.\r\n”Haló, kto je tam?”\r\n”Dobrý deň, šéfe, tu je Fero. Stala sa mi taká vec, rozbilo sa mi spätné zrkadlo na strane vodiča.”\r\n”A teraz čo? Tak ho vymeňte!”\r\n”Nemôžem, leží na ňom celý kamión.”              ', 282, 3.79, 2),
	(548, 'Muž si ženie svoje nové auto a čo by čert nechcel, napáli to do neho zozadu ženská. Muž vystúpi a vraví:\r\n”Čo nevidíš, ty sliepka jedna!”\r\nŽena nesmelo vystrčí hlavu z okienka a odpovedá:\r\n”Ko, ko, komu tykáš...”              ', 254, 3.83, 2),
	(549, 'Žena hovorí mužovi:\r\n”Naše auto má vodu v karburátore.”\r\nManžel na to:\r\n”Vodu v karburátore? To je somarina.”\r\n”Ver mi, karburátor je plný vody.”\r\n”Ty ani nevieš, čo to karburátor je. Ja sa na to pozriem. Kde je auto?”\r\n”V bazéne.”              ', 279, 4, 2),
	(550, 'Idú tri autá za sebou. Jedno zabočí doľava, druhé doprava a to tretie ide za nimi . \n', 91, 4, 2),
	(551, 'Motorkár minie stovkou značku obmedzujúcu rýchlosť na šesťdesiatku\r\na samozrejme za prvým kríčkom ho zastavia dopraváci.\r\n”Pán vodič, tak si hovorím, či vôbec viete čítať?”\r\n”Ale iste. Čo potrebujete?”              ', 243, 4.06, 2),
	(552, 'Spotený chlapík dotlačí starý trabant na čerpaciu stanicu a pýta si liter benzínu. Pumpár sa pýta:\r\n- Na naštartovanie?\r\n- Nie, na podpálenie!\n', 155, 3.73, 2),
	(553, '”Magduška, nechcete dnes večer odviesť domov na motorke?” pýta sa kolega.\r\n”Nie, ďakujem, ja pôjdem radšej peši. Som dnes veľmi uťahaná.”              ', 170, 3.14, 2),
	(554, 'Policajt zastaví vodičku v jednosmerke.\r\n”Toto je jednosmerka, tu sa môže jazdiť len jedným smerom.”\r\n”No a? Vari som išla obojsmerne?”              ', 164, 4.08, 2),
	(555, 'Kde je najväčší prázdny priestor v trabante?\r\nMedzi vodičovými ušami.\n', 78, 3.74, 2),
	(556, 'Otázka:	Prečo ide každý trabant rýchlo cez dedinu?\r\nOdpoveď:	Nuž, aby ho psy neroztrhali.              ', 110, 3.74, 2),
	(557, '- Prečo kúpil Škót manželke briliantový prsteň, hoci ona chcela auto?\r\n- Lebo falošné autá sa nevyrábajú.              ', 131, 3.96, 2),
	(558, '- Viete, že ste prekročili predpísanú rýchlosť? - vraví prísne dopravný policajt.\r\n- Ja viem, ale chcel som byť doma skôr, než začne účinkovať tá slivovica.              ', 187, 3.14, 2),
	(559, '- Čo je najväčším prianím majiteľa trabanta?\r\n- Dostať pokutu za prekročenie rýchlosti.              ', 111, 3.4, 2),
	(560, '- Haló, polícia? Išiel som autom a zrazil som dve sliepky, čo mám robiť?\r\n- No tak ich položte na krajnicu, aby neprekážali iným autám.\r\n- Áno, rozumiem. A čo mám urobiť s ich motorkou?\n', 201, 4, 2),
	(561, 'Novozbohatlík parkuje svoj Mercedes 600 a všimne si, že vedľa neho zaparkoval trabant a majiteľ poctivo zamyká a dôsledne kontroluje všetky dvere, či sa nedajú otvoriť:\r\n- Heej, na čo ten črep vôbec zamykáš? Toto je bezpečná štvrť, tu sa nekradne. Ani ja nezamykám mercedes, tak prečo sa s tým zdržiavaš ty?\r\n- Minule som nezamkol a mal som vnútri nasrané.\n', 384, 3.84, 2),
	(562, 'Dvaja novozbohatlíci idú na svojich mercedesoch 600, jeden v pravom jazdnom pruhu, druhý v protismernom a cez otvorené okná sa rozprávajú. Zrazu zozadu medzi nimi preletí trabant tak tesne, až im odtrhne spätné zrkadlá a stratí sa v diaľke. Po chvíli zozadu príde tretí novozbohatlík na Jeepe:\r\n- Tak čo, chalani, pekný gól som vám strelil?\n', 363, 3.89, 2),
	(563, 'Policajt zastaví viditeľne opitého motoristu. „Pán vodič, ste ochotný podrobiť sa testu na alkohol?"\r\n„Veľmi rád. A do ktorej krčmy pôjdeme?"              ', 170, 4.04, 2),
	(564, 'Automobilový pretekár zavolal na políciu, že mu vykradli auto: - Počujte, ukradli mi prístrojovú dosku, volant, brzdu, plyn, dokonca i riadiacu páku! Skôr ako stihli policajti začať niečo robiť, zazvonil telefón znovu: - Kašlite na to, sadol som si na zadné sedadlo.              ', 296, 3.42, 2),
	(565, 'Spotený vodič dotlačí trabanta na čerpaciu stanicu a pýta si 2 litre benzínu. Pumpár sa pýta: \r\n"Na naštartovanie?" \r\n"Nie, na podpálenie!"               ', 165, 3.38, 2),
	(566, 'Idú tri rádové sestry autom a dôjde im benzín. V diaľke vidia benzínovú pumpu a tak si povedia, že pôjdu s kanistrom pre benzín, ibaže jediná nádoba, ktorú v aute majú, je smaltovaný nočník. No, čo sa dá robiť, zájdu s nočníkom tam a načapujú, prídu naspäť a lejú obsah do nádrže. Vtom vedľa nich zastaví tirák a šofér s obdivom hovorí:\r\n- Teda sestry, vašu vieru by som fakt chcel mať!              ', 441, 3.89, 2),
	(567, 'Na križovatke je dopravná zápcha a jeden vodič neustále vytrubuje. Po chvíli príde z vedľajšieho auta k jeho okienku vodička a pýta sa ho: \r\n- Pán kolega, a čo ste ešte dostali na Vianoce?              ', 216, 4, 2),
	(568, 'Vodiči, ktorí sú za znižovanie spotreby pohonných hmôt, nech zdvihnú pravú nohu.              ', 102, 3.63, 2),
	(569, 'Predám auto s nehrdzavejúcou, pontonovitou karosériou, nepodliehajúcou módnym vplyvom, s dvojtaktným motorom pracujúcim na princípe náhodných výbuchov.\r\nZnačka: Wartburg 323 Sedan              ', 205, 3, 2),
	(570, 'Mladá adeptka vodičského kurzu prechádza vozidlom autoškoly cez dedinu a na elektrickom stĺpe zbadá elektrikára. Chvíľku sa zamyslí a povie: \r\n”Zbabelec.”              ', 183, 3.4, 2),
	(571, 'Príde sestrička v nemocnici k pacientovi, ktorý je celý v sadre. Pacient sa s vypätím síl pýta:\r\n"Sestra, neviete, či som ten vodičák urobil?"\n', 154, 3.5, 2),
	(572, '"Prečo mi vlastne nedovolíš sadnúť za volant, veď som už dosť starý!" pýta sa mladík otca.\r\n"Ty áno, ale auto ešte nie!"\n', 134, 3.71, 2),
	(573, 'Čo to znamená keď trabant jazdí na lúke Trabant dokolečka?\r\nMá pricviknutú trávu vo dverách.\n', 103, 2.8, 2),
	(574, 'Ako nazvete Ladu s dvoma výfukmi?\r\nFúrik.\n', 44, 3.87, 2),
	(575, 'Ako zdvojnásobíte cenu Trabanta?\r\nNaplníte mu nádrž benzínom.\r\nA ako ju strojnásobíte?\r\nKúpite viečko na nádrž.\n', 124, 3.8, 2),
	(576, 'Ako nazvete Ladu, ktorá vás predbehla?\r\nFatamorgána.\n', 56, 3.9, 2),
	(577, 'Ako to urobiť, aby Lada vyzerala lepšie?\r\nPostavíte ju na parkovisko plné Trabantov.\n', 89, 3.64, 2),
	(578, 'Ako sa hovorí Trabantu s brzdami?\r\nNadštandartne vybavená verzia.\n', 69, 3.85, 2),
	(579, 'Ako urobíte Trabant rýchlejším?\r\nOdťahovacím autom.\n', 58, 2.5, 2),
	(580, 'Ako sa nazývajú tlmiče nárazov v Trabante?\r\nCestujúci.\n', 60, 3.67, 2),
	(581, 'Nový Trabant ma Airbag.\r\nKeď vidíte, že asi dojde k nehode, začnete skutočne rýchlo pumpovať.\n', 102, 3.73, 2),
	(582, 'Cez noc som zaparkoval auto na ulici v New Yorku. Aby som odradil prípadných zlodejov, vybral som autorádio a za oknom nechal nápis:\r\n"Bez rádia, bez cenností, kufor prázdny."\r\nRáno som našiel auto s rozbitým oknom a k môjmu nápisu niekto pripísal:\r\n"Len pre istotu."\n', 281, 3.92, 2),
	(583, 'Recepčný v hoteli:\r\n"Mám pre vás, zlú a dobrú správu:\r\nZlá: Vaše zaparkované auto sa rozbehlo a spadlo do rieky.\r\nDobrá: Po ceste malo spotrebu len 2,37 l/100 km!"\n', 175, 3.9, 2),
	(584, 'Chlapovi sa na púšti pokazí auto. Otvorí kapotu, ale nevie, čo s tým. Zrazu sa vedľa neho objaví biely kôň, strčí hlavu pod kapotu a auto je opravené. Chlap večer rozpráva svoj zážitok Arabom. Keď skončí, jeden Arab mu hovorí:\r\n"To si mal celkom šťastie. Ešte tu behá taký hnedý, a ten autám vôbec nerozumie."\n', 339, 4.14, 2),
	(585, '"Narazil som do stromu", priznáva sa vodič auta v autoopravovni. \r\nAutomechanik prejde okolo auta a pýta sa: \r\n"Koľkokrát?"              ', 142, 3.77, 2),
	(586, 'Moja žena dnes zachránila život mnohým ľuďom!" \r\n"Nevrav, a ako?" \r\n"Nepodarilo sa jej naštartovať."              ', 122, 4.11, 2),
	(587, 'Posledné slová spolujazdca. Sprava môžeš!              ', 60, 3.82, 2),
	(588, 'Pred pôrodnicou zahvízdajú brzdy. Z auta vybehne udychčaný muž k zadným dverám, otvorí ich, zhrozene pozrie dovnútra a zúfalo vykríkne: “Preboha! A Marku som zabudol doma!”              ', 202, 4.27, 2),
	(589, 'Stretnú sa dve tatrovky v úzkej uličke.\r\n"Cúvaj," zavrčí jeden z tatrovkárov, "lebo urobím to isté, čo som urobil minule."\r\nDruhý pre istotu zaradí spiatočku a vycúva. Potom mu to predsa len nedá a pýta sa prvého tatrovkára:\r\n"Počuj, a čo si vlastne minule urobil?"\r\n"Vycúval som."		              ', 318, 3.25, 2),
	(590, 'Fero konečne dostal vodičský preukaz, a tak pozval dvoch kamarátov, že ich povozí. Po chvíli divokej jazdy ho jeden z nich požiadal, aby zastavil a vystúpil. Druhý to tiež dlho nevydržal a vystúpil aj on. Tak Fero pokračoval sám a pri rozbiehaní kričal za kamarátmi:\r\n"Vy ste ale zbabelci! Nič sa mi nemôže stať, lebo môj anjel strážny to nedopustí!"\r\nZrazu cíti, ako ho niekto zozadu klepe po pleci:\r\n"To som ja, tvoj anjel strážny. Zastav, prosím ťa, tiež radšej vystúpim."              ', 523, 3.8, 2),
	(591, 'Príde chlapík do lekárne a pýta si 500 metrov náplaste.\r\n"Načo to potrebujete?" pýta sa lekárnička.\r\n"Ale, rozbil som trabanta."\r\n"Na trabanta stačí 200."	    \n', 171, 3.57, 2),
	(592, 'Jeden chlapík má Trabant, a chodieva veľmi rýchlo. Druhého to už naštve, a tak si kúpi Octaviu. Vyhliadne si toho na trabante, a poďho za ním. Ale dobehnúť ho nemôže. To ho naštve ešte viac, a tak si kúpi Porsche. Znovu si\r\nho vyhliadne, a poďho za ním. Ale zas ho nemôže dobehnúť. Tak už totálne naštvaný si kúpi Ferrari, vyhliadne si trabanta a poďho za ním. Keď ho už predbieha, cez okno mu kričí: "A čo urobíš teraz?"\r\nA ten z Trabanta: "Hodím dvojku."              ', 508, 3.5, 2),
	(593, 'Šofér zastaví stopárke a pýta sa jej, kam ide.\r\n”Do Trnavy.”\r\nPo desiatich kilometroch jej vraví:\r\n”Dnes ste už tretia, čo ide do Trnavy a je tehotná.”\r\n”Ale ja nie som tehotná!”\r\n”Veď ešte nie sme v Trnave.”              ', 250, 3.43, 2),
	(594, 'Šejk sa rozhodne, že si kúpi najlepšie auto. Pozerá dodacie doby:\r\nRolls Royce -  mesiac\r\nTrabant - tri roky\r\n"Tri roky, to musí byť skvelé auto. To si objednám."\r\nNemci si dajú záležať a objednávku vybavia hneď. Pobočník to hneď ide oznámiť:\r\n"Je to fakt seriózna firma! Obratom poslali funkčný model z papundeklu."\n', 340, 3.91, 2),
	(595, 'Auto prechádza úsekom husto zaplneným dopravnými značkami. Zrazu ho zastaví skupina policajtov v slávnostných uniformách:\r\n"Pán vodič, práve ste úspešne absolvovali náš skúšobný úsek. Získali ste prémiu päťtisíc korún."\r\n"Zo srdca vám ďakujem, ale keby som mal vodičák, to by ste niečo videli!"\r\nManželka sediaca vedľa sa snaží zachrániť situáciu a vraví:\r\n"Neverte mu, on vždy tára, keď si vypije!"\r\nKeď svokra na zadnom sedadle vidí mračiace sa tváre policajtov, mravokárne káže:\r\n"Ja som vám vravela, aby ste nechodili s ukradnutým autom do mesta!"              ', 616, 4.14, 2),
	(596, 'Tatrovkár zastavil v motoreste, objednal si obložené rožky, kávičku a sadol si za stôl. Ledva sa pustil do jedenia, prišli dvaja motorkári na Harleyoch, prisadli si k nemu a všetko mu zjedli a vypili. Tatrovkár sa pokojne zdvihol, zaplatil a vyšiel von. Motorkári sa na seba chvíľu pozerajú a hovoria si:\r\n"No, tak toto bol nejaký zbabelec. Ani biť sa mu nechcelo..."\r\nČašník ich počul a hovorí:\r\n"Veru. Aj mne sa zdal nejaký divný. A navyše ani jazdiť nevie, lebo pred chvíľou pred vchodom precúval dve motorky!"              ', 557, 4.24, 2),
	(597, 'Ide auto po ceste a zrazu ho zastaví policajt:\r\nNo milý pán šofer dnes dávame peniaze vzorním vodičom ktorý nespravia žiadny priestupok.\r\nTo je skelé aspoň si spravim vodičák.\r\nVedľa neho sedí žena a hovorí: Nepočúvajte ho keď si vypije nevie čo hovorí!!!\r\nVzadu na sedadle sedí babka a hovorí:Ja som vám hovorila, že na tom ukradnutom aute ďaleko nezajdeme.\r\nA z kufra sa ozve: Už sme za hranicami?', 427, 3.88, 2),
	(598, 'Ide v aute bezvlasý a beznohý.  Bezvlasý vraví beznohému: "Dupni na to fáro nech mi veje háro!"', 102, 3.39, 2),
	(599, 'Zobudia sa dvaja v nemocnici a jeden z nich sa ozve: "Však som išiel..." A druhý na to: "Ale ja som ti kázal... Zľava voľno, zprava taky. Ale ja som vravel, že zľava voľno, zprava tanky."', 196, 3.7, 2),
	(600, 'Pýta sa koktavý muž v autobuse:\r\n"....Ppprrrrrrrosiiiimmmm vááás, koooooľko jeee hohohodííííín?"\r\nChlapík, ktorého sa to pýta mlčí, a tak mu odpovedia iní cestujúci.\r\nKeď koktavý vystúpi, cestujúci ktorý koktavému odpovedal sa chlapíka pýta:\r\n"Prečo ste mu neodpovedali???"\r\n"Bááál sooom ssssa, žežeže mi jeeeednu vraaaazzzíííí..."', 369, 3.57, 2),
	(601, 'Pred križovatkou hovorí vodič spolujazdcovi:\r\n- Prosím ťa, pozri, či mi funguje smerovka.\r\nTen otvorí okno, nahne sa a hovorí:\r\n- Funguje...nefunguje...funguje...nefunguje...', 182, 3.62, 2),
	(602, 'V autoopravovni:\r\n- Jožo, daj mi francuzák!\r\n- .....\r\n- Kľúč, ty hovado!', 77, 4.07, 2),
	(603, 'Hovorí kamarát kamarátovi:\r\n"Ja, až budem zomierať, tak nechcem žiadne stresy.\r\nChcem zomrieť ako môj dedko - v kľude, pohode, s úsmevom na perách... Keď všetci okolo neho šaleli z hrôzy - v aute..."', 214, 2.5, 2),
	(604, 'Vyťahujú sa Rus a Nemec jeden pred druhým, komu lepšie brzdí auto. Dohodnú sa, že to vyskúšajú. Nemec posadí Rusa do svojho BMW a rozbehne to 180-kilometrovou rýchlosťou proti betónovej stene. Keď sú tak 100 metrov od steny, pýta sa Nemec Rusa:\r\n- Už si sa strachom pošťal?\r\n- Pošťal. - prizná sa Rus.\r\nNemec na to dupne na brzdy a zastaví to tesne pred stenou. Potom vezme Rus Nemca do svojho Žiguláka a rozbehne sa 150 kilometrovou rýchlosťou proti betónovej stene. Keď sú tak 100 metrov od steny, pýta sa Rus Nemca:\r\n- Už si sa strachom pošťal?\r\n- Pošťal. - prizná sa Nemec.\r\n- No, tak sa môžeš aj posrať! Lebo toto ja veru neubrzdím...', 682, 4.29, 2),
	(605, 'Ide trabant po diaľnici a odrazu mu dôjde benzín.\r\nVodič čaká až ho niekto odtiahne. Zastaví mu vodič na Škode asi 120 a chvíľu ho ťahá. O malú chvíľu sa však niečo v škodovke pokazí a tiež zastane. Po chvíli im zastaví vodič BMW a povie: "Ako to tak vidím, tak vás vezmem oboch." Vodič trabantu podotkne: "Keď zatrôbim, tak spomalíme áno?""Spoľahnite sa", odpovie šofér BMW. Tak idú. Na diaľnici, pri radare stoja dvaja policajti a jeden hovorí druhému:"Ty, videl si to?""Nie.""Predstav si, že tu teraz prešlo BMW asi 180 km/h a ten druhý odpovie no a?""Preto ma nemusíš budiť.""Ale za ním išla škodovka takou istou rýchlosťou.""Vážne?"Ale,to nie je všetko, za nimi letel trabant a lietal zprava doľava a trúbil, že ich chce predbehnúť a tí debili ho nechceli pustiť." ', 830, 4.25, 2),
	(606, '- Zase si upratovala garáž bez môjho vedomia? - pýta sa muž ženy.\r\n- Áno, čo zase nemôžeš nájsť? - odpovedá mu žena.\r\n- Moju felíciu.', 149, 3.92, 2),
	(607, 'Ide traktor po diaľnici a pokazí sa mu motor. Zastaví mu škoda 120 a vraví: - Ja vás odtiahnem. Idú, idú a pokazí sa motor aj škode 120. Zastaví VOLVO a odtiahne oboch. Traktorista im vraví: - Ale keď pôjdete rýchlo budem trúbiť. Idú, idú a traktorista začne trúbiť. Na diaľnici stretnú aj policajtov. Jeden ich zbadá a vraví tomu druhému: - Videl si to?- Čo? - Išlo Volvo, za ním Škoda 120 a za ňou traktor. A ten na nich trúbil, že ich chce obehnúť!', 487, 3.74, 2),
	(608, 'Prečo sa trabant na lúke točí dookola na mieste?\r\nZabuchla sa mu do dverí tráva. \r\n', 89, 2.39, 2),
	(609, 'Manželka sa pýta manžela: - Miláčik, videl si už pokrčenú stokorunáčku?- No, videl. - A tisíckorunáčku?- Aj tú.- Ale pol milióna si ešte nevidel, že?- No to som ešte nevidel!- No tak sa choď pozrieť do garáže.  ', 233, 3.61, 2),
	(610, 'Čo je najväčšia drzosť na svete?\r\nSpýtať sa kolegyne, aký dezén má pneumatika okolo jej pása.', 104, 3.89, 2),
	(611, 'Ide Mercedes po ďialnici a po chvíli ho dobehne Trabant. Vodič Trabantu otvorí okienko a kričí na vodiča Mercedesu: "Poznáte Trabant?"\r\nVodič Mercedesu si samozrejme pomyslí, že ho chcel Trabant predbehnúť a tak zrýchli. Po krátkej chvíli Mercedes zase dobehne Trabant a toto sa opakuje asi ešte 3-krát až zase Trabant dobehne Mercedes a predbehne ho. Mercedes zrýchli. Po asi 5 minútach vidí vodič Trabantu Mercedes v priekope a vodiča na krajnici. Ako prechádza okolo, otvorí okienko a kričí: "Poznáte trabant?"Vodič Mercedesu zúfalo odpovie: "Áno."Vodič Trabantu: "A kde sú brzdy?"', 618, 4.14, 2),
	(612, 'Vymením trabanta za maštalný hnoj. Zn.: Hovno za hovno.', 58, 4.24, 2),
	(613, 'Cigáň a boháč si dávajú preteky.Cigáň si berie škodovku a boháč porsche. Cigáň vyhrá. Boháč si kúpi Ferrari, cigáň vyhrá. Boháč si kúpi najrýchlejšie auto na svete, už dobieha cigáňa a pýta sa cigáňa: "A čo teraz?"\r\nCigáň na to: "Teraz preradím na dvojku."', 291, 3.46, 2),
	(614, 'Vydavateľ časopisu o autách si chcel spraviť reklamu, tak sa postavil na ulicu, vybral si jedného okoloidúceho a pýta sa ho: "Ako často meníte olej?""Raz za rok."\r\n"A neškodí to vášmu vozidlu?"\r\n"Akému vozidlu? Veď ja mám stánok s hranolčekmi!!!"    ', 268, 2.74, 2),
	(615, 'Hádajú sa Rus, Nemec a Slovák, ktorý národ má lepšie auto, pokiaľ ho zabudnú zavrieť. Rus hovorí:\r\n„Keď zabudneme zavrieť auto, tak nám zapípa.“\r\nNemec hovorí:\r\n„Ha, naše auto je lepšie, keď ho zabudneme zavrieť, tak sa zatvorí samé.“\r\nA Slovák hovorí:\r\n„Chlapci, s nami sa nemôžete porovnávať. Keď my zabudneme zavrieť auto, tak sa stane neviditeľným.“\r\n', 399, 3.84, 2),
	(616, 'Zastaví šofér s autom pri prostitútke:\r\n- Čo spravíš za 100 euro?\r\n- Všetko!\r\n- Tak sadaj ideme betónovať.', 116, 4.26, 2),
	(617, '- Ako sa volá ruský automobilový pretekár?\r\n - ???\r\n- Benzín Petrolejovič Naftenko.', 89, 3.53, 2),
	(618, 'To viete ako prišiel k benzínke ten Hummer? Tankuje...tankuje... a asi po  45 minutách už je to pumpárovi blbé, tak vyjde von a zakričí na tankujúceho šoféra: "Hele šéfe, a nebolo by lepšie vypnúť ten motor?"\r\n', 226, 3.76, 2),
	(619, 'Príde muž domov a hovorí žene:\r\n- Kúpil som autorádio.\r\nA žena mu hovorí:\r\n- A načo, veď nemáme auto.\r\nMuž odpovedá:\r\n- Pozri, ja sa ťa tiež nepýtam načo máš podprsenku.', 188, 4.22, 2),
	(620, 'Ide ráno bača po ulici a zbadá Inda ako práši na balkóne koberec a vraví mu: Tož Aladin Čo?! Neštartuje, neštartuje?!', 128, 3.55, 2),
	(621, 'Koľko babiek roztláča auto? 56.\r\n50 sedí v aute, 5 na streche a 1  ide po pomoc.', 84, 3.11, 3),
	(622, 'Na Sibíri v strašnej zime hovorí babka svojmu vnúčikovi.\r\n- Iváňuška, zabila som kura na obed.\r\n- A čím si ho zabila bábuška?\r\n- Ale, na peci som našla nejaký bumerang, tak tým.\r\n- Bábuška, keď sa ešte ťaž dotkneš mojej ponožky, tak ti zlomím deku.', 272, 3.23, 3),
	(623, 'Letecká linka Moskva-Bratislava. Krátko po štarte vbehne do pilotnej kabíny muž s pištoľou v ruke a kričí: \r\n- Do Viedne.\r\nPilot mu odpovedá:\r\n- Nedá sa.\r\nMuž znervóznie a hovorí:\r\n- Do Viedne, lebo budem strielať.\r\n- Nedá sa, mladý muž. Obzrite sa, za vami sedí babka s bombou a už si objednala Mníchov.', 325, 3.95, 3),
	(624, 'Babka varí pri šporáku, keď dobehne dedko celý zadychčaný a kričí: \r\n"Babka rýchlo dvíhaj sukne, ide to na mňa".\r\nAle kým sa babka rozkýve dedka to prejde. Tak jej dedko hovorí: \r\n"Počuj babka, ak ma nabudúce uvidíš takto bežať, neváhaj a zdvihni sukne, lebo to už môže byť posledný krát".\r\nAsi tak o mesiac vidí babka z okna ako dedko strašne rýchlo uteká. Babka teda zdvihne sukne, vyskočí na posteľ a rozkročí nohy. Dedko dobehne a kričí: \r\n"Babka, ty sa tu vyvaľuješ a nám zatiaľ horí stodola".', 542, 3.54, 3),
	(625, '- Babka, nevadí vám, že bývate vedľa rómov?\r\n- Dik more, nééé!', 71, 3.13, 3),
	(626, 'Príde babka do obchodu, kde predávajú kondómy a jablká. Ukáže na jablká ale má krivý prst a tak si predavač myslí, že chce kondómy.\r\n"Prosím si kilo"- hovorí babka.\r\nZačudovaný predavač, mysliac si že chce kondómy, sa jej pýta:\r\n"Ale babka až kilo a čo budete s toľkým množstvom robiť?" \r\n"Ale, viete to mi večer s mužom žujeme pri televízore."', 376, 3.83, 3),
	(627, 'Príde babka k doktorovi lebo ju strašne bolia nohy.\r\n- Pán doktor, pomôžte mi prosím vás.\r\nDoktor ju prezrie, sadne si za svoj stôl napíše recept na nejakú masť a dáva ho babke so slovami:\r\n- Babka, natierajte si nohy touto masťou a dva týždne nechodievajte po schodoch. Potom sa mi prídete ukázať.\r\nPo dvoch týždňoch príde babka na kontrolu a hneď medzi dverami sa pýta doktora:\r\n- Pán doktor, prosím vás, už môžem chodiť po schodoch?\r\nDoktor sa pozrie na babku a vraví:\r\n- Myslím, že už hej.\r\n- To som rada, pán doktor, aspoň už nemusím po hromozvode.', 593, 3.69, 3),
	(628, 'Nastúpi babička do diaľkového autobusu a sadne si úplne dozadu. Po chvíli vstane, pristúpi k vodičovi s lieskovými orieškami na dlani a pýta sa ho:\r\n- Pán vodič, máte rád lieskové oriešky?\r\n- Ale áno, babička.\r\n- Tak tu ich zopár máte - vraví starenka a ide si zasa sadnúť. Po chvíli sa vráti, zasa s orieškami, a hovorí vodičovi:\r\n- Keď ich máte rád, tak si ešte vezmite.\r\nVodič si vezme, poďakuje a ide sa ďalej. O chvíľu sa to celé opakuje. Vodič to už nevydrží a pýta sa:\r\n- Prečo ma stále ponúkate, babi?\r\n- Vieš syn môj, som už stará, ani tie zuby mi už tak neslúžia, nemôžem tie oriešky rozhrýzť.\r\n- Tak prečo si ich potom kupujete, keď ich nemôžete rozhrýzť?\r\n- Ja oriešky nekupujem, synak, ale mám veľmi rada orieškovú čokoládu.', 809, 3.38, 3),
	(629, '- Babka, chytro, stojí mi! \r\n- Dedko, počkaj, ešte sa idem vycikať. \r\nO chvíľu dedko: \r\n- No už sa môžeš aj vysrať!', 126, 3.54, 3),
	(630, 'Príde pani do banky a chce zaplatiť šek. Pokladník jej hovorí:\r\n- Zabudli ste podpis.\r\n- A ako sa mám podpísať?\r\n- Tak ako na pohľadnici.\r\nPani zoberie pero a podpíše sa: \r\n- S láskou Mária.', 203, 3.59, 3),
	(631, 'Dve babky čítajú noviny:\r\n- Počúvaj toto: V Petržalke boli opäť znásilnené dve staré ženy..\r\n- No a my hlupane bývame v Ružinove!', 143, 3.21, 3),
	(632, 'V preplnenom autobuse MHD sa tlačí mladý muž na babku. Tá si pritlačí slamený košík k prsiam a hovorí:\r\n- Mladý muž, pozor na vajcia!\r\n- Och, prepáčte. Nesiete v košíku vajcia?\r\n- Nie. Klince!', 209, 3.33, 3),
	(633, 'Babičke, vášnivej čiateľke detektívok, podstrčia namiesto románu telefónny zoznam. Babka čítala, čítala a keď už dočítala poznamenala.\r\n- Od začiatku som tušila, že to urobila Žofia Žubrienková.', 217, 3.5, 3),
	(634, 'Jožko sa cez prázdniny prihlási do parašutického krúžku. Idú teda trénovať zoskoky. Jožko vyskočí z lietadla a potiahne za šnúrku, ale z batohu mu vypadnú jogurty. Jožko nepodlieha panike a potiahne za druhú šnúrku. Znova vypadnú jogurty. Jožko už stráca nervy. Vtom nahmatá vo veste list. Otvorí a číta: "Milý Jožko, babička ti nabalila veľa Monte..."', 384, 3.64, 3),
	(635, 'V ZOO upozorňuje babička svojho vnuka:\r\n- Janko, nechoď tak blízko k tomu ľadovému medveďovi, aby si neprechladol.', 121, 2.98, 3),
	(636, 'Za siedmimi horami, siedmimi dolinami, siedmimi moriami stojí chalúpka a v tej chalúpke za stolom sedí babka a nadáva: \r\n"Prečo ja musím tak ďaleko bývať!"', 165, 3.46, 3),
	(637, 'Rozprávajú sa dve babky:\r\n- Vieš o tom, že dnes zrazilo auto nášho kominára?\r\nDruhá babka hovorí: \r\n- To je strašné ako tí vodiči jazdia. Človek si nemôže byť istý ani na streche!', 197, 3.21, 3),
	(638, 'Babka umýva okná a nešťastnou náhodou sa pošmykne a BUM - objaví sa na ulici. Okoloidúci sa zbehnú a pýtajú sa:\r\n- Babi, čo sa tu robí?\r\nA babka nechápavo odvetí:\r\n- Ja neviem, ja som iba ščul došla!', 217, 3.18, 3),
	(639, 'Príde vnučka za babičkou a pýta sa: \r\n"Babíííí, čo je to milenec?" \r\nBabička zamrzne a zareve: \r\n"Ježišmária, milenec!!!"\r\nOtvorí skriňu a vypadne kostra...', 171, 3.5, 3),
	(640, '- Babka, aké knižky najradšej čítaš? - pýta sa vnúčik.\r\n- Ja mám najradšej historické. - odpovedá babka.\r\nVnúčik kuká do knižnice, jednu donesie babke.\r\n- Babka, ty ale klameš, veď to je samá erotika.\r\n- No veď pre mňa je to predsa história!', 264, 3.25, 3),
	(641, 'Ide Jožo domov a uvidí babičku ako sa šplhá po hromozvode. Nedá mu to a spýta sa jej.\r\n- Babička, čo to robíte?\r\n- Ale synak, bola som u doktora a ten mi povedal, že mám slabé srdce a nemám chodiť po schodoch.\n', 225, 3.33, 3),
	(642, 'Príde vnúčik za babkou a pýta sa:\r\n- Babi, čo je to milenec?\r\nBabka hrôzostrašne vykríkne:\r\n- Ježiš milenec!\r\nPribehne ku skrini, otvorí ju a z nej vypadne do tla obžratá kostra.', 191, 3.22, 3),
	(643, 'Stretnú se tri babičky a chvália sa svojimi vnukmi. \r\n- Môj bude doktorom. Stále sa hrá s ampulkami a striekačkami niečo si pichá.\r\n- Môj bude asi agronóm. Sadí na záhrade konope a mak a čaká na úrodu.\r\n- Môj bude určite šofér. Namočí si handru do benzínu, hodí si ju na hlavu a povie: "Teraz ma neruš babi, bude jazda."', 345, 4.07, 3),
	(644, '"Sranda musí byť!", povedala babka a hodila granát medzi hrajúce sa deti.', 77, 3.08, 3),
	(645, 'V noci vylezie dedko na babku a babka sa s nádejou v hlase pýta:\r\n- Čo chceš, dedko?\r\nDedko fňukavým hlasom odpovedá: \r\n- Chcem ísť dole.', 146, 3.07, 3),
	(646, '- Babka máte satelit?\r\n- Ná, šak čo by som sa mala teliť, čo som krava?', 77, 3.24, 3),
	(647, 'Babka hovorí dedkovi, ktorý je na strome a oberá jablká: \r\n- Dedko, dávaj pozor, aby si nespadol.\r\n- Há babka, už som spadol.', 132, 2.97, 3),
	(648, 'Babky triedia repu.\r\nJedna chytí do ruky repu a vraví:\r\n"Ój,takého má môj starý".\r\n"Čožéééé".Čudujú sa ostatné.\r\n"Takého macatého?"\r\n"Nie, takého zasratého". Sklamane odpovie prvá.', 201, 3.05, 3),
	(649, '- Ocko, ocko! Odnaučil som babku obhrýzať si nechty!\r\n- Ako sa ti to podarilo?\r\n- Schoval som jej zuby.', 106, 3.88, 3),
	(650, 'Babka sedí v kresle. Príde k nej mačka, vyskočí jej na kolená a začne priasť. Babka sa na ňu začudovane pozrie a vraví:\r\n- Ale Micka, však ja som ten svetrík už doplietla.', 185, 2.8, 3),
	(651, 'Príde babka do predajne s hračkami a vraví:\r\n- Včera som tu kúpila svojej vnučke skladačku puzzle a ona to mala za päť minút hotové. Nemáte niečo ťažšie?\r\nPredavač jej vraví:\r\n- Viete čo pani? Keď je vaša vnučka taká šikovná, tak jej kúpte päťnásť deka strúhanky, nech z toho skúsi poskladať rožok.', 332, 3.5, 3),
	(652, 'Babka sa sťažuje lekárovi:\r\n"Pán doktor, ja mám stále vetry, ktoré nie su cítiť ani počuť."\r\n"Babka, 5 dní berte tieto prášky a potom sa mi prídite ukázať."\r\nO 5 dní babka príde a hovorí:\r\n"Pán doktor, tie vetry mám stále a teraz sú už aj cítiť."\r\n"No vidite, čuch sme už napravili teraz ešte sluch."', 330, 4.11, 3),
	(653, 'Babka píše deťom list, dedko sedí vedľa a pýta sa:\r\n- Babka, a čože to robíš?\r\n- Ále, píšem deťom, že sa už máš lepšie. Ozaj, a ako sa správne píše ´pohrab´ alebo  ´pohreb´?', 199, 3.05, 3),
	(654, 'Prechádza stará babka cez cestu a policajt na ňu kričí:\r\n"Babka a po prechode by to nešlo?"\r\nA babka mu na to:\r\n"Išlo, išlo chlapče, ale nie si môj typ."', 163, 3.46, 3),
	(655, '"Sranda musí byť!"\r\nPovedala babka a spálila si dôchodok.', 61, 3.75, 3),
	(656, 'Interview s babkou:\r\n- Babka, nevadí vám, že bývate pri stanici?\r\n- Prečo by mi to málo vadiť, 13. koľaj.', 113, 3.15, 3),
	(657, 'Lekár vraví starej babke:\r\n- Nebojte sa, babička, mám pre vás zázračný liek. Po jeho užívaní omladnete o dvadsať rokov.\r\n- Joj, pán doktor, len aby som neprišla o dôchodok!', 187, 3.76, 3),
	(658, 'Stretnú sa dve smrdácke starenky a jedna hovorí druhej: \r\n- Ná počúvaj Marko, včera sa mi zjavila Panenka mária.\r\n- Nehovor. A čo ti povídaua?\r\n- Ná "baf".', 166, 3.33, 3),
	(659, 'Starenka nastúpi na autobus a hovorí: \r\n- Jeden lístok prosím.\r\nVodič sa jej pýta: \r\n- Kam chcete lístok teta?\r\n- Sem, do ruky.\r\n- Ale kam cestujete?\r\n- Ja idem na svadbu.\r\nNaštvaný vodič sa jej nervózne pýta: \r\n- Ale babka, kde bude ta svadba?\r\n- Keď bude pekne tak vonku, keď bude zima tak vnútri.', 314, 3.49, 3),
	(660, 'Babka kričí na deda:\r\n- Ešte raz sa vyčúraš mimo hajzla, tak ti fakt prisahám, že ti už nikdy nevrátim zuby!', 118, 3.17, 3),
	(661, 'Hovorí vnučka babke:\r\n"Babka vieš akého mám ja dobrého ženícha? Nepije, nefajčí, nefetuje, nedroguje, no je skvelý."\r\nBabka:\r\n"Hej? To si neber to je akési choré!"', 176, 3.34, 3),
	(662, 'Na Václavskom námestí v Prahe vykrikuje jedna babka:\r\n"Menstruacééé! Menstruacééé!"\r\nPríde k nej policajt a dohovára jej:\r\n"Babka, snad myslíte revoluce, ne?"\r\n"To je jedno, hlavne že pri tom teče krev!"', 217, 3.27, 3),
	(663, 'Pri dverách domčeka zvoní zvonček:\r\n- Babka! Otvorte nám!\r\nBabka bojazlivo odvetí:\r\n- Ktože ste chlapci? Ja vás nepoznám!\r\n- Babka, otvorte, my sme z márnice!\r\nBabka sa začuduje:\r\n- Ale ja som niktoho takého nevolala, chlapci!\r\n- Volala, nevolala, otvárajte! My musíme plniť plán!', 296, 3.41, 3),
	(664, '- Babka, prečo máš také červené oči?\r\n- Zvárala som vnúčik môj, zvárala...', 86, 2.94, 3),
	(665, '- Hej Jano, prečo si v čiernom?\r\n- Ale babička nám zomrela.\r\n- Však som ju ešte včera videl.\r\n- Hej, to sme ju museli držať na okne - poštárka niesla dôchodok.', 171, 3.34, 3),
	(666, '- Čo si pozerala včera?\r\n- Západ slnka.\r\n- A na ktorom programe?', 67, 3.12, 3),
	(667, 'Pýta sa vnučka babičky:\r\n"Babka prečo máš také veľké ústa?"\r\n"To vieš, to preto aby som mohla jesť horalku po dĺžke."', 131, 3.26, 3),
	(668, '- Suseda, neviete, prečo má pani Evka ustavične uplakané oči?\r\n- Ale, dala sa vraj dokopy s nejakým Cibulkom!', 115, 3.26, 3),
	(669, 'Nahluchlá babka okopáva počas SNP zemiaky. Ide okolo partizán a slušne pozdraví:\r\n- Smrť fašizmu!\r\nBabka sa dvihne a odzdraví:\r\n- Aj tebe synku, aj tebe!', 162, 3.69, 3),
	(670, 'Babka ochorie a tak ku nej zavolajú lekára. Keď odíde, babka pootvorí jedno oko a pýta sa:\r\n- Kto to bol?\r\n- Lekár babka, lekár.\r\n- Aha. Hneď sa mi zdalo, že na farára si moc dovoľuje.', 196, 3.28, 3),
	(671, 'Dedko s babkou sedia pri obede a babka spomína:\r\n"Jaaaj dedko,keď si spomeniem na krásne mladé časy,ej takto ma hreje pri srdiečku.\r\n"Bodaj by nie,keď máš prso v polievke!"', 181, 3.42, 3),
	(672, 'Ide babka po lese a zbadá hrýbik. Chce ho odtrhnúť, no hrýbik hovorí:\r\n- Netrhaj ma, splním ti tri želania.\r\n- Dobre. Chcem byť múdra.\r\nCINK\r\n- Mladá\r\nCINK\r\n- A to tretie si ešte rozmyslím.\r\nBabka ide ďalej. Zrazu sa potkne a zahreší:\r\n- Joj, ja hlupaňa stará!\r\nCINK', 284, 3.4, 3),
	(673, 'Ide chlapík po lese a zrazu zbadá babku vysiacu na konári a pýta sa: \r\n- Čo babka, Redbull?\r\n- Ale kde Redbull, PITBULL.', 125, 3.48, 3),
	(674, 'Anička: - Babička, prečo máš také veľké ústa?\r\nBabička: - Lebo jem horalky po šírke!', 96, 3.01, 3),
	(675, 'Babka chytí vnúčika za čelo a hovorí:\r\n- Vnúčik, si čoraz teplejší.\r\n- Nie babka, to ty si čoraz chladnejšia.', 121, 3.18, 3),
	(676, 'Prišla babka po čase k lekárovi a ten jej hovorí:\r\n- Babka, prečo ste u nás tak dlho neboli?\r\n- Jáj, bola som chorá pán doktor, chorá som bola.', 153, 3.35, 3),
	(677, 'Jurko hovorí netešene mamičke:\r\n- Mami, už som odnaučil babičku obhrýzať si nechty.\r\n- A ako si to dokázal?\r\n- Schoval som jej zuby.', 141, 3.16, 3),
	(678, '"Babka, prečo máš také veľké oči!"\r\n"Ale Zuzka, to mi nedáš pokoj ani na záchode!?"', 93, 3.83, 3),
	(679, 'Príde babka k doktorovi a vraví mu:\r\n"Pán doktor, mne tmavnú nohy."\r\n"A umývate ich?"\r\n"A to pomáha?"', 107, 3.45, 3),
	(680, 'Hovorí babka vnučke: \r\n- Ver mi, Saška, v živote ženy býva len jedna veľká láska. \r\n- A kto to bol u teba, babi? \r\n- Námorníci.', 138, 3.12, 3),
	(681, 'Babka hovorí dedkovi:\r\n"Hej starý poď sa hrať na vtáčikov!"\r\n"Ok."\r\nHovorí dedulo. Babka bola lastovička a štebotala, dedo bol vrabec a čvirikal. O chvíľu dostane babka chuť na sex a hovorí:\r\n"Dedko dajme si!"\r\n"Čim, čim?"', 238, 3.3, 3),
	(682, 'Dedka prešiel parný valec. Babka nevedela čo s ním, tak ho dala predo dvere ako rohožku. Ľudia chodili, utierali si do neho mokré topánky, dedko prechladol a zomrel.', 173, 3.2, 3),
	(683, '- Babka, môžem ísť na záchod? \r\n- Áno, len sa neposer po ceste!', 69, 2.93, 3),
	(684, 'Za siedmimi horami, za siedmimi dolinami, za siedmimi moriami, za siedmimi krajinami stojí malá chalúpka. Otvoria sa na nej dvere, vyjde z nej starenka a hovorí:\r\n- Ej, ale bývam ďaleko!', 192, 3.43, 3),
	(685, 'Príde babka do obchodu a pýta si anti-viagru. Lekárnička sa čuduje:\r\n"Načo to potrebujete?"\r\n"Aaaale pre dedka."\r\n"Veď dedko si tu včera kupoval viagru!"\r\n"Dedko nám do rána umrel a teraz nemôžeme zatvoriť truhlu."', 227, 3.44, 3),
	(686, '- Babka, môžem sa ti hrať s prsiami?\r\n- No dobre, ale nechoď veľmi ďaleko.', 80, 3.4, 3),
	(687, 'Babka ide cez prechod a tesne pred ňou zabrzdí tank.\r\n"Tank, ak ma prejdeš tak ťa zjem!"\r\n"...a tak si babka pokazila žalúdok."', 133, 3.32, 3),
	(688, 'Istota je istota, povedala babka a nasadila na sviečku aj druhý prezervatív.', 79, 3.32, 3),
	(689, '"Babka uhnite!"\r\na babka uhnila...', 34, 3.49, 3),
	(690, 'Taký normálny žiak Jurko si chce skočiť s padákom z lietadla. Nasadne spolu so spolužiakmi do lietadla. Keď sú vo vhodnej výške, pilot prikáže zoskočiť.\r\nJurko skočí a keď je vo výške 1500 metrov, skúša otvoriť padák. Zatiahne za ľavú páku a zľava sa sypú samé jogurty, skúša druhú, ale zase iba jogurty. Na boku uvidí papier s odkazom.\r\n"Milý Jurko, babička ti na cestu nabalila veľa Monte. Dobre si to rozdel."', 449, 3.29, 3),
	(691, '"A bude tu poriadok!"\r\npovedala babka a šupla hovno pod posteľ...', 67, 3.69, 3),
	(692, 'Babička sa odchadzajúc z krematória smutne obzrie na čierny dym vychádzajúci z komína a povzdychne si:\r\n"Tak vidíš dedko, konečne ťa niekto vyfajčil až do konca."', 175, 3.23, 3),
	(693, 'Babka príde zablahoželať svojmu vnúčikovi ktorý má chromé nohy všetko najlepšie k narodeninám a vraví:\r\n"Všetko najlepšie k tvojjím narodeninám, hlavne veľa zdravia a aby si spravil ešte veľa štastných krokov do ďalších rokov."', 251, 3.02, 3),
	(694, 'Nastúpi babenka do autobusu a pýta sa šoféra: \r\n- Nechcete oriešky?\r\n- Áno ďakujem.\r\nNa druhý den to isté a šofér hovorí: \r\n- Dajte si aj vy!\r\n- Ja už nemôžem, ja už nemám zuby.\r\nNa tretí deň:\r\n- Synček nechceš oriešky?\r\nŠofér už celý zvedavý sa opýta:\r\n- Babka a odkiaľ máte tie oriešky?\r\n- Z Tofiffe.', 333, 2.91, 3),
	(695, 'Mamička sa chystá do obchodu a vraví synovi: \r\n- Janko, pokiaľ budem preč, tak prosím ťa postráž babku.\r\nMamička odišla, Janko šiel k babke a vraví: \r\n- Bubububu, ty stará krava.', 192, 3.28, 3),
	(696, 'Ide babka na WC a namiesto do ženského vojde do mužského. Tam ju zastaví muž a hovorí:\r\n"Babka, sem nemôžete ísť, to je iba pre pánov."\r\n"No a čo, a chudoba sa má posrať!"', 186, 3.32, 3),
	(697, 'Príde babka od holiča a pýta sa? \r\n- Jožko, že už nevyzerám ako stará babka?\r\n- Nie babi, teraz vyzeráš ako starý dedko.', 131, 3.11, 3),
	(698, 'Príde babička do preplneného autobusu. Mladík sa jej pýta: \r\n- Babička, chceli by ste si sadnúť?\r\n- Áno, synak.\r\n- A kde?', 130, 3.12, 3),
	(699, 'Sedí mladík v autobuse a pri ňom stojí starenka. Už dosť dlho stojí a rada by si sadl, tak sa mladíka opýta: \r\n- Chlapče, ešte je to ďaleko na konečnú?\r\n- Ale hej babka, veľmi ďaleko. Ešte sa dosť nástojíte!', 227, 3.07, 3),
	(700, 'Babička dobehne k lekárovi a hovorí:\r\n- Pán doktor, ja som sa chcela doma pochváliť ale zabudla som, akú to mám chorobu. Ba-ba-baroko, či rokoko?\r\n- Babi, rakovina!', 173, 2.92, 3),
	(701, 'Prechádza babka cez koľajnice a nevšimne si vlak, ktorý jej následne amputuje obe nohy. Babka po počiatočnom šoku začne lamentovať.\r\n- Ách moje nohy, moje nohy!\r\nOkoloidúci skín jej na to odvrkne.\r\n- Čo reveš, veď žiadne nemáš.', 246, 3.01, 3),
	(702, '- Babka, ty si stále hovorila, že máš rada knihy o dejinách, ale v tvojej knižnici sú samé sexuologické príručky.\r\n- Veď práve. Pre mňa je to už iba história.', 174, 3.19, 3),
	(703, 'Babka sa hrabe v latríne, ide okolo poštár a pýta sa:\r\n- Babka, čo sa hrabete v tej latríne?\r\n- Ale, spadla mi tam zástera.\r\n- Hádam ju nechcete nosiť?\r\n- Nie, ale vo vrecku som mala olovrant!', 201, 3.06, 3),
	(704, 'Načo nám je WC papier! - povedala babka a oblízala si ruku.', 62, 3.07, 3),
	(705, 'Dve susedy ohovárajú Maru.\r\n- Len si to predstavte suseda, má 50 rokov, muža má, milenca má a ešte ju aj včera večer v parku znásilnili.\r\n- Tá sa ale má!', 165, 3.11, 3),
	(706, 'Babka sa chystá s dedkom na prechádzku:\r\n- Dedo, mám si vziať podprsenku?\r\n- Len si vezmi. Vonku je blato.', 110, 3.23, 3),
	(707, 'Babka príde do mäsiarne a vraví:\r\n- Dobrý deň, nemáte niečo pre psa?\r\nA predavač na to:\r\n- Budú? Alebo reťaz?', 119, 2.94, 3),
	(708, 'Pýta sa vnučka babky:\r\n- Babi, čo si taká smutná, čo máš na srdci?\r\n- Strojček!', 88, 3.27, 3),
	(709, 'Babička príde k doktorovi a ten jej hovorí:\r\n- Máte choré srdce. Nechodievajte veľmi po schodoch. O rok sa mi príďte ukázať.\r\nBabička o rok príde a pýta sa doktora:\r\n- Pán doktor, už môžem chodiť po schodoch?\r\n- Áno, babička, môžete.\r\n- Chvalabohu, po odkvapovej rúre sa mi už liezť nechce.', 315, 3.28, 3),
	(710, '- Babka, máte satelit?\r\n- A čo som krava, aby som sa telila?', 62, 3.31, 3),
	(711, 'Aforizmus:\r\nPoštový holub príde ku mojej babke skôr ako SMS.', 64, 3.04, 3),
	(712, 'Ide babka do obchodu a spomenie si, že zabudla vypnúť sporák.\r\nTak sa aspoň pomodlí:\r\n"Anieličku, môj strážničku\r\nochraňuj moju dvojplatničku \r\na prepni zo šestky na jedničku."', 191, 3.44, 3),
	(713, 'Príde babka k doktorovi s prestreleným kolenom a lekár sa jej pýta:\r\n- Ako sa vám to stalo?\r\n- Ale chcela som spáchať samovraždu.\r\n- Samovraždu, a prečo ste si strelili do kolena?\r\n- No písali tam, že si mám priložiť pištoľ dva centimetre pod prsia.', 266, 3.38, 3),
	(714, 'Babička sa pýta doktora:\r\n- Pán doktor, akože sa to volá ten nemec, čo mi furt doma schováva veci?\r\n- Alzheimer, babička, Alzheimer.', 140, 3.28, 3),
	(715, 'Babka spadne z 13. poschodia. Postaví sa omráčená a opráši sa. Okolo sa nahrnie hŕba ľudí medzi nimi aj policajt a ten sa babky pýta:\r\n- Babka čo sa tu stalo?\r\n- Ja ti neviem synak, ja som teraz prišla.', 214, 3.51, 3),
	(716, 'Tetka sa rozpráva po omši so susedou:\r\n- Počula si to? Ferdina na omši chrápala.\r\n- No jasné, všetky nás pobudila. ', 123, 2.99, 3),
	(717, 'Viete, čo je to maximálna drzosť? \r\nPonúknuť babke dôchodkovú reformu.', 77, 2.67, 3),
	(718, '- Stará mama, už viem, prečo máš také veľké oči. To máš z telenoviel.', 80, 3.11, 3),
	(719, 'Stretnú sa dve babky. Jedna má zostarnutú tvár a tá druhá peknú bez vrásky. Prvá babka sa pýta druhej:\r\n- Ako to robíš, že máš takú peknú tvár?\r\nDruhá jej odpovedá: \r\n- Vieš čo je na rybičky otvárak, ten si priložím na čelo a našpanujem si tvár.\r\n- A čo sú tie dva malé pupáky na čele?\r\n- To sú bradavky!', 339, 3.03, 3),
	(720, 'Príde babka do spovedelnice a potkne sa\r\n"Do zadku, tu je ale tma."\r\nFarár na to:\r\n"Babka, tu sa tak nerozpráva."\r\n"Ach do zadku, ale som sa ťa naľakala."', 159, 2.92, 3),
	(721, 'Hygiena nadovšetko! \r\nPovedala babka a umyla si nohy v guláši.', 65, 2.76, 3),
	(722, 'Pýtajú sa babky na ulici:\r\n- Aký je váš názor na mladú generáciu?\r\n- No viete, ja som proti vstupu do NATO.', 115, 2.93, 3),
	(723, 'Malý Jožko kričí cez celý dvor:\r\n- Tato, sliepky prdia.\r\nOtec mu odpovedá:\r\n- Nie Jožko, v kuríne je stará mama. ', 122, 2.98, 3),
	(724, '"Babka a nevadí vám, že bývate pri autostráde?"\r\n"... nnniiieeeeeee ..."', 77, 3.46, 3),
	(725, 'Jednou pošle babka dědka do sklepa a říká mu: \r\n"Dědku dones mi tři věci, slyšíš tři věci: petržel, mrkev a cibuli." \r\nDědek de do sklepa a je tam půl hodiny, hodinu ... Za dvě hodiny vyleze ze sklepa a v ruce má kýbel a lopatu, a babka na něj křičí: \r\n"Dědku, sklerotiku nevíš že jsem říkala tři věci, kde máš krompáč?"', 355, 3.29, 3),
	(726, '- Stará mama, prečo máš také veľké a vypúlené oči?\r\n- Vnúčik môj, aspoň na záchode mi daj pokoj!', 111, 3.54, 3),
	(727, 'Ide babka v minisukni po ulici. Zastaví ju policajt:\r\n"Ale babka, vy predsa nemožete chodiť v takej krátkej sukni!"\r\n"A čo, mám krivé nohy?"\r\n"Nie. Trčia vám prsia!"', 174, 3.38, 3),
	(728, 'Hovorí babka susedke:\r\n- Predstavte si, ako tá medicína pokročila. Keď som mala 18 rokov, musela som sa ešte vždy u doktora vyzliecť. Dnes už stačí, keď ukážem jazyk.', 180, 3.1, 3),
	(729, 'Novinár robí rozhovor s babkou, ktorá mala šesťnásť detí a nikdy nebola v nemocnici.\r\n- Pani, ako je to možné? Mali ste šesťnásť detí a nikdy ste neboli v nemocnici. Môžete nám to vysvetliť?\r\n- Jaj, synak, koľkokrát som si vravela, si chorá, je ti zle, musíš ísť k tomu doktorovi, ale vždy mi do toho prišlo dieťa.', 343, 3, 3),
	(730, 'Vojaci obsadili dedinu a začali znásilňovať všetky ženy.\r\nPrišlo aj na starú babku. Dedko dohovára vojakom:\r\n"Nehanbíte sa, veď je stará!"\r\n"Čus dedko, zahriakne ho babka, vojna je vojna!"', 201, 3.1, 3),
	(731, '- Pán doktor, akože sa to volá tá moja choroba? Baroko? Rokoko?\r\n- Babka, dokedy vám to mám vysvetlovať? Už si to konečne zapamätajte ra – ko – vi - na.', 166, 2.93, 3),
	(732, 'Naskakuje babka na vlak, pripravme si kamery, \r\nurčite sa pod vlak šmykne, to budú cool zábery... ', 102, 2.53, 3),
	(733, 'Na koľajách babka stála, do diaľky sa pozerala.\r\nMala smolu však, od zadu šiel vlak.\r\nA teraz má rušňovodič na okienku fľak.', 135, 3.65, 3),
	(734, 'Vnučka sa pýta babky: \r\n- Stará mama, čo je to impotent? \r\n- Opýtaj sa deda, on to vie.', 92, 3.06, 3),
	(735, 'Vybrala sa babka s puškou do lesa a stretla mladého muža. Keď muž uvidel pušku začal kričať:\r\n- Nestrieľajte babka, ja Vás nechcem znásilniť! \r\n- Ja viem, ale budeš musieť!', 187, 3.24, 3),
	(736, 'Stará, škaredá babka s bradavicami na tele a sovou na pleci stretla v lese muža:\r\n- Ak uhádneš, čo to mám na pleci môžeš ma pomilovať.\r\n- Slon?, háda mladík.\r\n- No, nie je to presné, ale dá sa to uznať!', 219, 3.63, 3),
	(737, '- Stará mama, už viem prečo máš také veľké oči. To máš z tých telenoviel.', 85, 3.11, 3),
	(738, 'Na nemenovanej miestnej linke nastúpi babka do autobusu. Autobus ide pomaly. Babka pristúpi k šoférovi a vraví:\r\n- Pán šofér, idete s nami ako s hnojom!\r\nŠofér:\r\n- Čo mi nastúpilo, to aj veziem!', 206, 3.31, 3),
	(739, 'Farár stretne babku a hovorí jej:\r\n- Babka počul som, že veľa nadávate.\r\nBabka:\r\n- Sú to chujoviny, pán farár, samé chujoviny...', 138, 3.39, 3),
	(740, 'Terka a Janka stoja pri plote. Terka s dôverou povie Janke: \r\n- Vieš, keď je v lete teplo, ja nenosím podprsenku.\r\n- Aha a ja som sa čudovala, čo ti to stále vytŕča spod minisukne.', 189, 3.16, 3),
	(741, 'Rozprávajú sa Erža s Marčou.\r\n- Ty Eržo, môj Joži má asi vysokú teplotu.\r\n- Ako vieš? Merala si mu ju?\r\n- Nie, ale dala som mu papuče a začali tlieť!', 162, 2.3, 3),
	(742, 'Stará babka stopuje vedľa cesty. Zástavy jej mladík na motorke. Babka nasadne a mladík vyrazí.Pri 100 km za hodinu babka zružovie, mladík si myslí, že sa jej to páči a tak zrýchli na 120 km za hodinu. Babka očervenia a mladík nadšený, zrýchli na 160 km za hodinu a babka spurpurovie. Mladík zastane a spýta sa babky: \r\n- Tak čo babka, páčilo sa vám to?\r\n- Ta hej, páčilo, ale nabudúce si do loďky nezabudni namontovať dno.', 451, 2.8, 3),
	(743, 'Cez mesto si vykračuje 90-ročná babka v odvážnej minisukni. Stretne ju policajt a vraví:\r\n- Ale babka, vy už nemôžete vo vašom veku nosiť také minisukne! \r\n- Nie, a prečo? Azda mám krivé nohy?\r\n- Nie, ale vykukujú vám spod nej prsia!', 250, 3.22, 3),
	(744, 'Babka s dedkom idú do mesta a vidia nápis NIVEA OMLADZUJE. Tak si ju kúpia a idú do lesa, že ju tam vyskúšajú. Po chvíli sa stretnú a babka hovorí.\r\n- Dedko, ono to fakt funguje. Utekala som ako 15 ročná.\r\n- Máš pravdu babka, ja som sa dokakal ako trojročný.', 275, 3.23, 3),
	(745, 'V parku sedí babka. Okolo ide robotník:\r\n- Babi, tá lavička je čerstvo natretá!\r\n- Ako prosím?\r\n- Na zeleno!', 115, 3.27, 3),
	(746, 'Príde babka ku gynekologovi a hovorí:\r\n- Pán doktor ja mám nejaký čudný hnedý výtok.\r\n- Babka, to nie je výtok, to je hrdza.', 134, 3.13, 3),
	(747, 'Sprievodca vo vlaku vraví: \r\n- Išla raz babka po železničnom prechode, tak sme zablikali, aby nás zbadala - ona nič. Tak sme zatrúbili malou trúbou, aby nás počula - ona nič. Tak sme zatrúbili veľkou trúbou, aby to s ňou zatriaslo - ona nič. Tak sme začali brzdiť. Zastali sme a babka už pod tretím vagónom.', 328, 2.65, 3),
	(748, 'Ide babka po ulici a pred Sexshop-om vidí štát dlhý rad žien. Pýta sa poslednej:\r\n- Slečinka a čo tu dávajú?\r\nOna sa otočí a hovorí babke:\r\n- Cukríky babka, cukríky.\r\nTak sa babka postaví do radu a po chvíli príde ďalšia žena, postaví sa do radu za babku a pýta sa udivene babky:\r\n- Babka a vám to ešte chutí?\r\nBabka hovorí:\r\n- Pravdaže slečinka, len aby bol tvrdý a vydržal celú noc!', 416, 3.37, 3),
	(749, '- Stará mama, prečo máš také veľké ústa?\r\n- Aby som mohla jesť horalku po dĺžke!', 91, 3.14, 3),
	(750, 'Babka si vyberá v banke peniaze a slečna pri prepážke jej hovorí:\r\n"Pani, ale zo zadnej strany, tam dolu sa musíte aj podpísať."\r\n"A čo to tam mám napísať, dcérenka moja?" \r\n"No normálne, tak ako sa podpisujete na listy." \r\nA babka napísala: \r\n"Všetkých vás pozdravujem a bozkávam. Vaša babka..."', 316, 3.35, 3),
	(751, 'Príde babka do spovedelnice a hovorí:\r\n- Kurva, aká je tu tma.\r\nFarár otvorí okienko a hovorí:\r\n- Babka, tu sa nenadáva.\r\n- Och ti chuj, ako som sa ta zľakla.', 166, 3.51, 3),
	(752, 'Ide babka po lese a zrazu nájde na zemi podkovu, otočí ju a vidí koňa.', 75, 2.56, 3),
	(753, 'Ako poznáte Esmeraldin dom??\r\nNa dverách nemá kukatko.', 57, 3.25, 3),
	(754, 'Išiel Janíčko s babkou do obchodu a Janíčko vidí na zemi stokorunáčku. Pýta sa babičky: Babi môžem si zobrať zo zeme tú stokorunáčku? Nie Janíčko,zo zeme sa nič nezbiera. Janko si kúpil banán. Šupku hodil na zem. Babička sa na nej šmykla a hovorí: Janko zodvihneš ma? A Janko hovorí: babička zo zeme sa nič nezbiera.   ', 348, 2.69, 3),
	(755, 'Babka,nevidela si niekde tie tabletky s nápisom LSD, čo som mal položené v obývačke?"\r\n*Ser na prášky, ale videl si toho draka v kuchyni??"', 147, 4.12, 3),
	(756, 'Idú dve babky po púšti jedna uvidí strom s jablkami odtrhne slivku a povie to je ale dobra čerešňa.', 106, 3.06, 3),
	(757, 'Idú babky po pusti a prepadnú ich potápači.', 47, 3.23, 3),
	(758, 'Hádajú sa dve babky ktorá je v strede', 40, 3.61, 3),
	(759, 'Ide babka po pusti a spadne na ňu balkón', 42, 2.89, 3),
	(760, 'Sranda musí byť!! povedala babka a spláchla dôchodok..', 58, 3.36, 3),
	(761, 'Ide babka s vnučkou z obchodu a vnučka nájde na zemi 100sk. Spýta sa babky, môžem zobrať tú stovku. Babka povie, nie zo zeme sa veci nezbierajú. Potom sa babka šmykne na banánovej šupke a povie vnučke, pomôž mi. A vnučka na to, zo zeme sa veci nezbierajú. \r\n\n\n ', 278, 2.72, 3),
	(762, 'Ide babka do kostola a v kostole si spomenie na to, že nevypla sporák. V kostole sa za to modlí: Anjeličku môj strážničku ochráň moju dvojplatničku.', 159, 3.29, 3),
	(763, 'Ide babka po púšti a spadne na ňu bojler.', 44, 2.47, 3),
	(764, 'Idú dve babky po ulici a tretia hovorí: "Z nás štyroch by bola dobrá pätica!"', 83, 3.82, 3),
	(765, 'Babka spadne z 13. poschodia a okolo nej sa hneď nahrnie hŕba ľudí. Medzi nimi stojí aj policajt, ktorý sa babky pýta: - Babka, čo sa tu deje? A babka mu odvetí: - Ja ti synku neviem, ja som iba teraz prišla.', 218, 3.38, 3),
	(766, 'Ide babka s vnučkou a vnučka nájde na zemi 1000 korún, vnučka sa pýta: "Babka, môžem si tých 1000 korún zobrať?""Nie, zo zeme sa nezbiera..", odpovie babka.  Idú ďalej a naraz babka spadne do žumpy a zakričí na vnučku o pomoc.  Vnučka jej odpovie: "Ale veď si vravela, že zo zeme sa nezbiera.."\r\n', 316, 3.11, 3),
	(767, '- Viete, čo je najväčšia staroba?\r\n- .. keď babke aj parochňa šedivie! ', 78, 3.42, 3),
	(768, 'Príde babka do obchodu, kde predávajú kondómy a jablká. Ukáže na jablká, ale keďže má krivý prst, predavač si myslí, že chce kondómy. "Prosím kilo." - hovorí babka. Začudovaný predavač, mysliac si, že chce kondómy, sa jej pýta: "Ale babka až kilo? A čo budete s toľkým množstvom robiť?" "Ááále viete, to mi večer s mužom žujeme pri televízore."    ', 385, 3.91, 3),
	(769, 'Prídu k babke partizáni a schovajú sa u nej v pivnici. Prídu Nemci a pýtajú sa babky, kde schovala partizánov. Babka sa bráni, že ich neschovala, a tak jej Nemci odrežú obe nohy. Keď odídu, vyjdú z pivnice partizáni a vravia: br />"Vidíte babka, lož má krátke nohy."', 285, 2.89, 3),
	(770, 'Staršia pani si kúpi papagája, donesie ho domov a pýta sa ho: "Tak čo hlupáčik maličký, vieš rozprávať?"A on na to: "Ja viem, a čo škrata zmachlená, ty vieš lietať?"', 182, 3.61, 3),
	(771, 'Babka varí pri šporáku, keď dobehne dedko celý zadychčaný a kričí: "Babka rýchlo dvíhaj sukne, ide to na mňa"Ale kým sa babka rozkýve, dedka to prejde. Tak jej dedko hovorí: "Počuj babka, ak ma nabudúce uvidíš takto bežať, neváhaj a zdvihni sukne, lebo to už môže byť posledný krát"', 310, 2.79, 3),
	(772, 'Ide Janko s babkou a spýta sa jej: "Môžem si zobrať túto desať korunačku?"A babka mu odvetí: "Nie, to čo je na zemi sa nezbiera." Idú ďalej, keď naraz spadne babka a povie Jankovi: "Pomôž mi Janko."A Janko jej odvetí: "Nie, nemôžem, to čo je na zemi sa nezbiera."', 281, 3.31, 3),
	(773, '- Ahoj, kam ideš?\r\n- Na jahody.\r\n- Teraz v zime?\r\n- Neboj sa, ja mám teplý sveter.', 85, 3.51, 3),
	(774, 'Istota je istota, povedala babka a vpichla do dedka piaty nôž.', 64, 2.73, 3),
	(775, 'Idú dve babky a hádajú sa, že ktorá bude v strede.', 55, 3.63, 3),
	(776, 'Vnučka sa pýta babky:\r\n"Babka prečo máš také veľké oči?"\r\n"Čuš moja, nevidíš že seriem?"', 102, 3.89, 3),
	(777, 'Babička hovorí vnúčatám:\r\n"Skleróza je super vec, každý deň sa dozvedám samé novinky."', 97, 3.77, 3),
	(778, '- Babka, a prečo máš také veľké oči??? - Aby som ta lepšie videla.- Babka, a prečo máš také veľké uši???- Aby som ta lepšie počula.- A babka, a prečo máš také veľké ústa???- Aby som mohla žrať horálky po dĺžke!!!', 241, 3.81, 3),
	(779, 'Babka s dedkom chodia do kostola. Dedko vždy zaspí, tak si babka berie so sebou paličku, že ho pichne, aby sa prebudil. Prídu do kostola a dedko zaspí. Pán farár sa pýta: "Koho považujeme za spasiteľa?" Babka pichne dedka a ten vykríkne: "Ježiši Kriste!" A farár odpovie: "Áno, správne." Dedko zase zaspí. A farár sa pýta: "Koho považujeme za Kristovho otca?"Babka pichne dedka a ten vykríkne: "Pane Bože."A farár odpovie: "Správne."A dedko zase zaspí. Farár sa pýta: "Čo povedala Eva Adamovi keď splodili 300-sté dieťa?"A babka zase pichne dedka a dedko vykríkne na celý kostol: "Ak ma s tým ešte raz pichneš, tak ti to pichnem do riti!!!"', 677, 4.15, 3),
	(780, 'Idú dva babky po púšti a hádajú sa, ktorá bude v strede...', 64, 3.33, 3),
	(781, 'Sedí babka na zastávke a okoloidúci jej hovorí: "Babka a vy načo čakáte, veď ten autobus chodí len cez sviatky?!"A babka odpovedá: "To nevadí, ja mám dnes narodeniny.."', 180, 3.67, 3),
	(782, '"Poriadok musí byť." - povedala babka a kopla hovno pod posteľ.', 66, 3.55, 3),
	(783, 'Babka prechádza cez ulicu tam, kde nie je označený prechod pre chodcov. Policajt ju zastaví a pýta sa: "Babka a po prechode by to nešlo?" Babka sa na neho pozrie a hovorí: "Ale šlo synáčku, ale to už to nie potom ono."', 229, 1.81, 3),
	(784, 'Hygiena musí byť povedala babka a okúpala si nohy v guľáši.\r\n', 67, 3.39, 3),
