	(876, 'Blondínka si nechala urobiť plastickú operáciu. Lekári neverili, že majú blondínky naozaj taký malý mozog a tak, keď už bola v narkóze otvorili jej hlavu. A tam uvideli iba jeden dlhý medený drátik...Ten odstrihli a blondínke odpadli uši.', 256, 3.25, 4),
