	(878, 'Blondínka si v lietadle sadne k oknu, o chvíľu k nej príde fešný chlapík a hovorí:\r\n- Prepáčte slečna, ale toto sedadlo je moje.\r\n- Daj si odpich mladý, také blbé finty poznám... neopaľuj!\r\nChlapík pokrčí plecami a prehodí: \r\n- No tak si s tým Boeingom štartuj sama!', 288, 3.38, 4),
