	(880, 'Viete, čo sa stane, keď sa zrazia dve blondínky?\r\nRozbije sa zrkadlo.', 72, 3.31, 4),
	(881, 'Viete prečo si blondínka zlomila ruku?\r\nKeď hrabala lístie padla zo stromu.', 79, 3.25, 4),
	(882, 'Príde blondínka do reštaurácie a objedná si pizzu.\r\nČašník sa jej spýta:\r\n- Mám Vám tu pizzu rozkrájať na štyri alebo na osem časti?\r\n- Radšej na štyri, osem by som asi nezjedla.', 195, 3.79, 4),
	(883, 'Príde blondína na políciu:\r\n- Okradli ma, okradli ma, ukradli mi kabelku!\r\n- Prosím vás, nekričte. Ako je možné, že ste necítili, ako vás okradli. \r\n- Ale cítila, cítila, ale netušila som, že druhou rukou okradnú!', 229, 3.25, 4),
	(885, 'Viete kedy je blondína v rozpakoch?\r\nKed má za uchom tampón a hľadá ceruzku...', 83, 3.32, 4),
	(886, 'Najnovšia dopravná značka pre blondínky.\r\nKoniec kruhového objazdu.', 72, 3.36, 4),
	(887, 'Blondína vojde do sexshopu a hneď od dverí kričí:\r\n- Dajte mi tieto vibrátory.\r\nPredavač sa pýta:\r\n- Z ktorých prosím?\r\n- Tak 1 biely, 1 žltý a ten červený.\r\n- Biely stojí 999 Sk, žltý 1199 Sk, ale hasiaci prístroj vám dať nemôžeme.', 254, 3.57, 4),
	(888, 'Dve blondínky sa rozprávajú\r\n- Dnes som prišla o panenstvo.\r\n- A bolo to z lásky alebo pre peniaze?\r\n- Podľa mňa z lásky, však čo už dnes kúpiš za tisicku.', 168, 3.02, 4),
	(889, 'Dve blondínky sa rozprávajú:\r\n- Kúpila som si švihadlo. \r\n- Prosím ťa a načo ti bude? \r\n- Urobila som si z neho troje tangáče a ešte mi ostali dva vibrátory.\n\n', 171, 3.76, 4),
	(890, 'Keď naraz vyskočia z okna blondínka a brunetka, ktorá z nich skôr dopadne?\r\nBrunetka, lebo blondínka na prvom poschodí zablúdi.', 135, 3.34, 4),
	(891, 'Blondínka sa sťažuje priateľke: \r\n- Zdá sa mi, že mi bol manžel neverný...\r\n- Ako si na to prišla? - čuduje sa priateľka.\r\n- Naša najmladšia dcéra sa hrozné podobá na susedku!', 191, 3.25, 4),
	(892, 'Stoja dve blondínky na letisku a rozprávajú sa:\r\n-Ty, počúvaj. Ja ti vôbec nechápem, ako tí teroristi môžu ukradnúť také veľké lietadlo!\r\n- Šmária, ty si blbá! Veď oni ho nekradnú na zemi, keď je také veľké, ale vo vzduchu, keď je také maličké!', 272, 3.36, 4),
	(893, 'Bavia sa dve priateľky - blondíny:\r\n- Ako si na tom s tým tvojim?\r\n- Dobre. Už spomenul aj manželstvo.\r\n- Naozaj?\r\n- Áno. Povedal, že má ženu a dve deti.', 162, 3.65, 4),
	(894, 'Viete, čo robí blondínka v kúpeľni, keď kričí "haló, haló"? \r\nVyvoláva fotky!', 88, 3.46, 4),
