	(896, 'Viete, kedy ide blondínka do lesa s potápačskými okuliarmi?\r\nKeď zistí, že je hlboký!', 93, 3.18, 4),
	(897, 'Viete, prečo blondínka v zime stojí vždy v rohu?\r\nPretože je tam 90 stupňov.', 82, 3.78, 4),
	(898, 'Viete ako sa zrútila helikoptéra s blondýnou?\r\nBolo jej chladno,tak vypla ventiláciu.', 89, 3.28, 4),
	(899, 'Vieš ako v sobotu večer rozosmeješ blondínu?\r\nŽe jej v stredu večer povieš dobrý vtip!', 94, 3.28, 4),
	(900, 'Viete ako blondína zabije vtáka?\r\nHodí ho z útesu!', 54, 3.12, 4),
	(902, 'Viete, čo sa stane, keď sa narazia dve blondínky?\r\nRozbije sa zrkadlo.', 73, 3.52, 4),
	(903, 'O čom sa hádajú štyri blondínky v aute?\r\nKtorá bude sedieť pri okne.\r\nA o čom sa hada päť blondínok v aute?\r\nKtorá bude sedieť na rýchlostnej páke.', 162, 3.22, 4),
	(904, 'Išiel raz jedným mestom pápež na svojom papamobile. Papamobil už vychádza z mesta keď tu zrazu pápež vidí ako k nemu /papamobilu/ uteká blondínka. Chcel zastaviť a počkať kým dobehne, ale ochranka poznamenala:\r\n"Nie v žiadnom prípade ideme ďalej, to bude dáky terorista."\r\nPo pár kilometroch sa blondíka stále nevzdáva a uteká stále za papamobilom. Pápež ochranke:\r\n"Zastavte dáme tej chudere požehnanie, veď keď stále beží za nami"\r\nOchranka:\r\n"Nie ideme ďalej to bude terorista."\r\nPo ďalších 5km a blondínka zo zúfalým pohľadom a jazykom až po zem sa nevzdáva. Pápež:\r\n"Zastavte dám je požehnanie a..."\r\nOchranka:\r\n"Nie to bude terorista."\r\nPápež:\r\n"Nie to nebude terorista  prikazujem zastaviť...IHNEĎ"\r\nPapamobil zastaví, blondíka dobehne a... zadychčane povie:\r\n"Jednu malú citrónovú a jahodovú."', 861, 3.81, 4),
	(905, 'Ako zamestnať blondínu na celý deň?\r\nPostavíš ju do okrúhlej miestnosti a povieš jej aby si sadla do rohu.', 114, 3.95, 4),
	(906, '- Mami, čo je to ten francúzsky sex? - pýta sa blondínka - začiatočníčka.\r\n- No to je, ... keď sa oblizuje tam, kde sa ciká.\r\nPo chvíli sa slečna vráti a znova sa pýta:\r\n- A to treba oblízať aj dosku, alebo stačí len misa?!', 241, 3.6, 4),
	(907, 'Stretnú sa dve blondínky a jedna hovorí:\r\n"Včera,keď sa vypol prúd, ostala som tri hodiny zaseknutá vo výťahu!"\r\n"To je nič! ja som zasa tri hodiny stála na pohyblivých schodoch!"', 191, 3.33, 4),
	(908, 'Sexi blondínka v super krátkej minisukni sedí za barovým pultom a pije kávu. Po čase chce zaplatiť a tak zavolá na barmana:\r\n- Mám jednu malú čiernu.\r\n- To vidím! -  odpovedá barman.\r\n- ...a stojí? - dokonči otázku blondínka.\r\n- Všetkým naokolo.', 264, 3.29, 4),
	(909, 'Idú dve blondínky po ulici a jedna hovorí druhej.\r\n- Pozri sa na toho psa s jedným okom.\r\nDruhá si zakryje jedno oko a hovorí: \r\n- Kde?', 141, 3.31, 4),
	(910, 'Stretnú sa dve blondíny a jedna vraví druhej:\r\n- Ak uhádneš, koľko mám lakov, dám ti obidva.\r\nA druhá na to:\r\n- Neviem, tri?', 133, 3.34, 4),
	(911, 'Blondínka listuje v telefónnom zozname.\r\n- Novák, Novák, Novák... Dofrasa! Ten má ale veľa telefónov!', 109, 2.95, 4),
	(912, 'Blondínka stojí na zastávke. Príde k nej druhá a hovorí jej:\r\n- Na aký autobus čakáš?\r\n- Na jednotku a ty?\r\n- Ja na dvojku. Aha dvanástka, môžeme ísť spolu.', 171, 3.35, 4),
	(913, 'Viete, čo znamená, keď majú blondínky modriny okolo pupku?\r\nŽe ani blonďáci nie sú na tom lepšie.', 107, 3.15, 4),
	(914, 'Idú dve blondínky neskoro v noci cez les. Samozrejme sa veľmi boja, tak sa chytia za ruky. Naraz jedna začne strašne kričať. Druhá sa jej pýta:\r\n- Čo je, čo sa stalo?\r\n- Volačo sa mi obtrelo o moju ľavú nohu.\r\n- Čo to bolo?\r\n- Moja pravá noha.', 259, 3.18, 4),
	(915, 'Ako spoznáte, že v úrade pracuje blondína?\r\nV sklade je posteľ a v kancelárii sa všetci chlapi usmievajú.', 113, 3.14, 4),
	(916, 'Dcéra blondínka hovorí svojej mame blondínke:\r\n- Nezabudni, že keď budeš nabudúce v spoločnosti hovoriť o našom veku, musí byť medzi nami minimálne 9 mesiacov rozdiel!', 181, 3.17, 4),
	(917, 'Stretnú sa dve blondínky a jedna sa pýta druhej:\r\n- Kde pracuješ? \r\n- Robím sekretárku. \r\n- A čo to je za práca? \r\n- No, prídem tam, urobím šéfovi kávu, pobavíme sa, niečo napíšem, potom idem na obed, zasa mu spravím kávu, pobavíme sa, niečo napíšem a idem domov. A ty? \r\n- Ja tiež robím šlapku, ale nemám toľko toho písania.', 354, 3.32, 4),
	(918, 'Víte co dělá blondýnka když má položené ucho na kolejnici?\r\nPoslouchá METAL.\r\nA víte co dělá,když má položené ucho na kolejnici a jede za ní vlak? \r\nPoslouchá DEATHMETAL.', 188, 3.26, 4),
	(919, 'Blondínka letí z Viedne do New Yorku. Predošlý večer zavolá na informácie na letisko:\r\n- Mohli by ste mi prosím vás povedať, ako dlho trvá let z Viedne do New Yorku?\r\n- Momentík...\r\n- Ďakujem!\r\nA položila slúchadlo.', 230, 3.35, 4),
	(921, 'Blondína je v autoškole a na konci robí ústne skúšky. Skúšajúci sa pýta: \r\n- Viete mi opísať ako funguje motor?\r\n- Môžem vlastnými slovami?\r\n- Áno.\r\n- Brm brm brm brrrrrm.', 187, 4.02, 4),
	(922, 'Dve blondýnky jedou spolu ve výťahu. Náhle se výťah zastaví. Po chvíli jedna začne volať o pomoc. Pak řekne té druhé:\r\n"Hele, nebude lepší, když budeme kričet společne."\r\nA tak tá druhá spustí:\r\n"Společne, společne ."', 240, 3.15, 4),
	(923, 'Ako nazývajú blondínky na vysokej škole?\r\nNávšteva.', 57, 3.19, 4),
	(924, 'Ako si sadnú 4 blondínky na jednu stoličku?\r\nOtočia ju naopak.', 66, 3.19, 4),
	(925, 'Prečo sa blondínky nehrajú na počítači? \r\nLebo sa boja myši.', 67, 3.18, 4),
	(926, 'Čo urobí blondínka,ak si chce dať jahodový jam?\r\nOlúpe si buchtu.', 71, 3.38, 4),
	(927, 'Prečo blondínky nevaria sáčkové polievky? \r\nPretože ešte stále neprišli na to, ako naliať liter vody do sáčku.', 122, 3.27, 4),
	(928, 'Proč je většina vtipů na blondíny tak krátká?\r\nAby je pochopily i chlapy.', 80, 3.52, 4),
	(929, 'Ako sa cíti blondínka obklopená bláznami? \r\nPolichotená.\n', 62, 3.06, 4),
	(930, 'Čo je to maximálna blbosť?\r\nKeď blondínka zahoráčka je policajtka.', 73, 3.41, 4),
	(931, 'Dve blondíny na brehu rieky, jedna na pravom a druhá na ľavom. V tom sa jedna zastaví a kričí na druhú:\r\n"Hej, nevieš mi poradiť ako sa dostanem na druhú stranu?"\r\n"Si ty ale blbá, veď ty už si na druhej strane."', 225, 3.25, 4),
	(932, 'Ako zistíme, že blondínka prišla o panenstvo?\r\nVšetky pastelky sú lepkavé.', 81, 3.08, 4),
	(933, 'Aký je rozdiel medzi blondínkou a mliečnym zubom?\r\nMliečny zub vie kedy má vypadnúť.', 91, 3.35, 4),
	(934, 'Je plná trieda blondínok. Učiteľ skúša jednu blondínku z matiky.\r\n"No napríklad milá Zuzka, koľko je 2+2."\r\n"Päť."\r\nOstatné blondínky začnú kričať všetky spolu:\r\n"Dajte jej šancu, dajte jej šancu!"\r\nUčitel, že dobre, ale iba jednu.\r\n"No Zuzka 5+5."\r\n"13."\r\nBlondínky znovu:\r\n"Dajte jej šancu, dajte jej šancu!"\r\nNo dobre blondínky, fakt už naspoledy:\r\n"Zuzka 1+1."\r\n"2."\r\nA blondínky znovu:\r\n"Dajte jej šancu, dajte jej šancu."', 458, 3.32, 4),
	(935, 'Co dělá blondýna, když přijde do koupelny, zhasne světlo a začne\r\nřvát?\r\nChce vyvolat film.', 100, 3.34, 4),
	(936, 'Viete ako hrajú blondínky ruskú ruletu? \r\nPäť lentiliek a jedna antikoncepčná tabletka.', 94, 3.48, 4),
	(937, 'Aký je rozdiel medzi blondínou a cestou?\r\nŽiadny, lebo na obidvoch sa derú gumy.', 84, 3.21, 4),
	(938, 'Viete ako zamestnáte blondínu na celý deň?\r\nDáte jej papier a na obidve strany napíšete \' otočiť \'.', 108, 2.93, 4),
	(939, 'Volá rozrušená blondínka svojmu manželovi do práce na dôležitú schôdzu:\r\n- Miláčik mám strašný problém!\r\n- Ale drahá, vieš predsa, že mám schôdzu a naozaj teraz nemám čas riešiť tvoje problémy!\r\n- Prosím...\r\n- No dobre o čo ide?\r\n- Neviem si rady s poskladaním puzzle.\r\n- Na krabici od puzzle je predsa obrázok, ktorý máš poskladať. Zober ho a povedz mi čo na ňom je.\r\n- Je tam taký macko, ktorý papá nejaké hnedé guličky.\r\n- To sú corn-flakesy!', 488, 3.19, 4),
	(940, 'Rozprávajú sa dve blondínky.\r\n- Kde si bola na dovolenke?\r\n- Na Kréte.\r\n- A prečo si ma klamala, keď si hovorila, že pôjdeš do Grécka.', 144, 2.98, 4),
	(941, 'Prečo ma blondína na nočnom stolíku aj prázdny aj plný pohár?\r\nLebo keď sa v noci zobudí, buď je smädná alebo nie.', 126, 3.17, 4),
	(942, 'Pride blodína do sex shopu a pýta sa.\r\n"Máte vibrátory?"\r\n"Áno."\r\n"Tak si prosím ten biely, čierny a ten červený."\r\n"Ten čierny a červený vám predať môžem, ale ten hasiaci prístroj na predaj nie je."', 216, 3.56, 4),
	(943, 'Aké sú prvé slová blondínky keď sa ráno zobudí?\r\nDobré ráno, chlapci!', 79, 3.19, 4),
