	(945, 'Prečo chodia po meste minimálne dve blondínky spolu?\r\nLebo jedna nikdy nevie.', 80, 3.21, 4),
	(946, 'Lekár vraví blondínke:\r\n- Vyzlečte sa a ľahnite si. \r\nBlondínka:\r\n- A to len tak bez predohry?', 100, 3.25, 4),
	(947, 'Jaký je rozdíl mezi blondýnou a boingem?\r\nv boeingu nebyl každej.', 69, 3.11, 4),
	(948, 'Policajt vidí ísť po ceste nádherné športové červené auto. Nedalo mu to a zastavil ho. Vystúpila z neho prekrásna dlhonohá a prsnatá blondínka. Policajt si od nej vypýtal doklady a spojil sa s dispečingom, či to auto nie je kradnuté. \r\n"Sedí v ňom taká nenormálne krásna blondínka?" opýtal sa dispečer.\r\n"Áno"\r\n"Vráť jej doklady a stiahni si nohavice."\r\n"...ale to predsa..."\r\n"Nestaraj sa a urob čo ti hovorím."\r\nPolicajt vrátil blondínke doklady, poodstúpil od auta a stiahol si nohavice. \r\n"Pre boha, zasa dychová skúška?!" zvolala blondínka.', 583, 3.61, 4),
	(949, 'Ide blondínka autom a zrazu zbadá, že uprostred kukuričného poľa sedí iná blondínka v člne a urputne vesluje. Zastaví auto, vystúpi, podíde ku kukuričnému poľu a kričí:\r\n- Ty sprostaňa, to kvôli takým ako si ty sa o nás rozprávajú také vtipy. Keby som vedela plávať, tak k tebe priplávem a takú ti jednu strelím...', 344, 3.28, 4),
	(950, 'Blondínka príde do podniku so záujmom o prácu sekretárky. Riaditeľ sa pýta: \r\n- Ako vám to ide na písacom stroji? \r\nSlečna sa začervená a povie: \r\n- Tam som to ešte neskúšala.', 190, 3.6, 4),
	(951, 'Viete prečo blondínka prebaľuje svoje dieťa iba raz za týždeň?\r\nPretože na krabici od plienok je napísané: do 12 kg.', 126, 3.68, 4),
	(952, 'Vraví doktor blondínke: \r\n- Je mi ľúto, máte rakovinu.\r\nBlondínka na to: \r\n- A čo to bude? Chlapec alebo dievča?', 120, 3.04, 4),
	(953, 'Prečo bola blondína sklamaná z výletu do Londýna?\r\nLebo zistila, že BIG BEN sú hodiny.', 93, 3, 4),
	(954, 'Vieš čo robí blondína, keď ošúpe banán?\r\nHľadá baterky.', 65, 3.28, 4),
	(955, 'Čo urobí blondínka, keď počuje vtip o blondínke?\r\nUteká sa pozrieť do zrkadla na vlasy.', 95, 3.1, 4),
	(956, 'Prečo blondínky nekoja svoje deti?\r\nLebo vyváranie bradaviek strašne bolí.', 79, 2.97, 4),
	(957, 'Ako spoznáte, že na počítači pracovala blondína?\r\nPodľa korektora na obrazovke.', 86, 3.24, 4),
	(958, 'Viete, čo si myslí blondína keď umýva okná?\r\nŽe pracuje vo Windowsoch.', 77, 2.99, 4),
	(959, 'Jaký je rozdíl mezi blondínkou a žehlícím prknem?\r\nŽehlícímu prknu jdou špatně roztáhnout nohy.', 107, 3.15, 4),
	(960, 'Príde blondínka do predajne a pýta:\r\n- To je posteľ?\r\n- Áno. Vodná posteľ.\r\n- A nejakú suchozemskú nemáte?', 116, 3.09, 4),
	(961, 'Blondíne začne horieť dom a tak volá požiarnikov:\r\n- Prosím Vás, rýcho príďte, horí mi dom!\r\n- Ukľudnite sa a povedzte ako sa k Vám dostaneme.\r\n- Nóóó... požiarnickym autom.', 190, 3.05, 4),
	(962, 'Inštruktor na vodičskom kurze:\r\n"Čo by ste robili, keby vám počas jazdy vypadlo koleso?"\r\nBlondínka:\r\n"Pridala by som a dobehla ho."', 138, 3.06, 4),
	(963, 'Viete, čo robí blondínka, keď hádže na prechode na zem pukance?\r\nKŕmi zebru.', 83, 3.07, 4),
	(964, 'Prečo pečie čokoládový koláč 11 blondínok?\r\nJedna mieša cesto a ostatných 10 šúpe lenitlky!', 103, 3.03, 4),
	(965, 'Príde blondínka do obchodu a povie:\r\n- Prosím si tri pomarančové júsi.\r\nPredavač jej hovorí:\r\n- To sa číta "džúsi".\r\n- Tak potom si prosím tri pomarančové džúsi a kilo džabĺk.', 194, 3.02, 4),
	(966, 'Čo robí desať blondínok na dne atlantického oceána?\r\nHľadajú Leonarda Di Capria.', 88, 3.28, 4),
	(967, 'Prečo blondínka oblizuje hodinky?\r\nLebo Tic-Tac obsahuje iba dve kalórie.', 76, 3.47, 4),
	(968, 'Príde blondína do obchodu a hovorí predavačovi:\r\n"Prosím si tamten televízor."\r\n"Zmizni, blondínam nepredávam!"\r\nA tak sa blondína zamaskuje, dá si parochňu a hovorí:\r\n"Prosím si tamten televízor."\r\n"Všakže vy ste blondína?"\r\n"Ako ste na to prišiel?"\r\n"To nie je televízor ale mikrovlnka!"', 308, 3.14, 4),
	(969, 'Čo sa deje, keď stojí blondína v ďaždi pod lipou s hrnčekom v ruke?\r\nRobí si lipový čaj.', 98, 3.06, 4),
	(970, 'Čo znamená keď blondínka leje vodu do počítača?\r\nChce si zasurfovať na stránkach internetu.', 100, 2.71, 4),
	(971, 'Prečo blondínka nosí hodinky na nohe?\r\nAby kráčala s dobou.', 64, 3.19, 4),
	(972, 'Ako blondínka zabije kapra?\r\nUtopí ho.', 40, 2.88, 4),
	(973, 'Čo znamená keď príde blondína do školy?\r\nNávšteva.', 58, 2.9, 4),
	(974, 'Vo výskumnom stredisku vykonávajú skúšku nového detektoru lži. Blondíny sa pýtajú:\r\n"Čo si myslíte o dnešnej politike?"\r\nOdpovedá:\r\n"Ja si myslím..."\r\nPÍÍÍP', 174, 3.08, 4),
	(975, 'Ako rozsvieti blondínka po sexe?\r\nOtvorí dvere na aute!', 57, 3.22, 4),
	(976, 'Ide blondína s walkmanom po chodníku, zrazu jej walkman spadne na zem a blondína stuhne. Príde mladík k walkmanu, nasadí si ho na uši a počuje:\r\n"Pravá, ľavá, pravá..."', 180, 3.24, 4),
	(977, 'Čo má spoločné blondína a motocykel?\r\nNemáš rád, keď na tom jazdí kamarát!', 85, 3.22, 4),
	(978, 'Vieš čo sa stane, keď sa zrazia dve blondíny?\r\nRozbije sa zrkadlo.', 70, 3.29, 4),
	(979, 'Vieš čo robí blondína, keď sa pozerá na hviezdy?\r\nNič, nemôže predsa robiť dve veci naraz.', 100, 3.16, 4),
	(980, 'Dve blondínky sa plavia na člne, jedna vypadne a utopí sa.\r\nDruhá si povzdichne:\r\n- Do frasa, ako je to možné? Veď mala na nohách lodičky.', 147, 3.12, 4),
	(981, 'Jedou tři ženy ve výtahu - brunetka, černovláska a blondýna. Najednou se výtah zasekne. Chvíli křičí střídave o pomoc, nejprve brunetka, po ní černovláska a nakonec slabým hláskem blondýnka:\r\n"..pomoc,.. pomoc...!"\r\nNačež se brunetka naštve a povída:\r\n"Hele, tak takhle né. Musíme křičet všechny společně."\r\nA blondýnka začne:\r\n"Společně..! společně!.. společně.!"', 402, 3.2, 4),
	(982, 'Papež je na návštěvě v nejmenované zemi, projíždí v papamobilu freneticky jásajícími davy, když tu se tímto davem začne tlačit dopředu blondýnka. Zoufale se probojovává dopředu, lidi si říkají, ejhle, ta je správná věřící, a pouštějí ji.Konečně se blondýnce podaří se k probojovat k papamobilu, papež se k ní skloní a říká: \r\n"Co si přeješ, děvče?" \r\nA blondýnka zadýchaně vyhrkne: "Jednu vanilkovou, prosím."', 461, 3.46, 4),
	(983, 'Čo si pomyslí blondínka, keď na chdníku pred sebou\r\nzbadá šupku od banána?\r\n"Zase spadnem!"', 99, 3, 4),
	(984, 'Na břehu řeky stojí blondýna a  ptá  se druhé blondýny stojící na protějším břehu : \r\n" Hej, ty, nevíš jak se dostanu na druhý břeh ?"\r\n" Ale vždyť ty  už jsi na druhém břehu !  "', 201, 3.02, 4),
	(985, 'Viete prečo blondína chodí pod sprchou?\r\nPretože používa šampón Wash and Go!', 84, 3.45, 4),
	(987, 'Prečo je blondínka ráno fazuľu?\r\nAby mala večer perličkový kúpeľ.', 74, 2.78, 4),
	(988, 'Blondína sa pýta kamarátky:\r\n- Prší pred hlavným vchodom?\r\n- Áno.\r\n- Tak pôjdem zadným.', 96, 3.09, 4),
	(989, 'Viete prečo boh stvoril blondínu?\r\nLebo ovca Vám neprinesie pivo.\r\nA viete prečo boh stvoril brunetku?\r\nLebo blondína tiež nie.', 133, 3.15, 4),
	(990, 'Blondína hrá futbal s brunetou. Brunetka dá gól a vykrikuje:\r\n- Jedna nula, jedna nula.\r\nPo chvíli dá gól aj blondína a vykrikuje:\r\n- Dve nuly, dve nuly.', 161, 3.04, 4),
	(991, 'Prečo majú blondínky truhlu do Y?\r\nLebo keď zavrú oči, rozťahujú nohy.', 78, 3.06, 4),
	(992, 'Čo hľadá blondínka v kvetinárstve?\r\nMužské semeno!', 57, 3.51, 4),
	(993, 'Čo robí blondínka s otepom slamy v ruke?\r\nNesie si svoju externú pamäť.', 77, 2.88, 4),
	(994, 'Zastaví kamión na červenú, k vodičovi pribehne blondína a zaťuká na okienko. Vodič ho stiahne a blondínka na neho:\r\n- Volám sa Mária, idem za vami a celou cestou strácate náklad!\r\nVodič kývne hlavou, zasvieti zelená! Na ďalšej križovatke sa scéna opakuje. Na tretej červenej to vodič nevydrží, vystúpi z kamióna, zaťuká na okienko auta blondíny a keď ho blondína stiahne, tak hovorí:\r\n- Ja som nejaký Karol, je zima, sme v Stropkove a ja sypem soľ na cestu! ', 493, 3.17, 4),
	(995, 'Čo robí blondína, keď chodí po štvornožky?\r\nPasie kozy.', 62, 3.18, 4),
	(996, 'Dve blondíny stoja na letisku pri pokladni a prvá sa pýta:\r\n"Tam to lietadlo ma prepraví do Viedne?"\r\n"Nie."\r\nA druha blondína sa pýta:\r\n"A mňa?"', 152, 3.79, 4),
	(997, 'Šéf blondínke:\r\n- Váš nástupný plat ja 7000 Sk. Neskôr môžete mať plat 12000 Sk.\r\nBlondínka:\r\n- Tak ja teda prídem radšej neskôr.', 144, 3.11, 4),
	(998, 'Vieš čo urobí blondínka keď jej zasvietiš do ucha baterkou? Rozsvietia sa jej očičká.', 94, 2.99, 4),
	(1000, 'Ako vykrútite blondíne krk?\r\nNasypete jej trochu zrna do miešačky.', 70, 3.89, 4),
	(1001, 'Hrá blondína a brunetka futbal a brunetka dá gól a hovorí:\r\n"Jedna nula."\r\nHrajú ďalej a gól dá pre zmenu blondína a hovorí:\r\n"Druhá nula."', 151, 3.31, 4),
	(1002, 'Čo sa opýta blondínka tesne po tom ako porodí dieťa?\r\nJe naozaj moje?', 74, 2.95, 4),
	(1003, 'Čo sa stane, keď sa blondínka postaví k múru?\r\nMúdrejší ustúpi.', 72, 3.23, 4),
	(1004, 'Prečo sa blondínka poserie predo dvermi obchodného domu?\r\nPretože tam je na dverách napísané TLAČIŤ.', 109, 3.18, 4),
	(1005, 'Jedna blondínka hovorí druhej:\r\n- Môj frajer ma včera zneužil!\r\n- Preboha a to už ako? - pýta sa druhá.\r\n- To vieš. Pozvala som ho na byt a on sa najedol, napil a potom si jednoducho odišiel!', 201, 3.24, 4),
	(1006, 'Čo znamená, keď sa blondína prefarbí na čiernovlásku?\r\nUmelá inteligencia!', 82, 3.28, 4),
	(1007, 'Blondína je na vyšetrení mozgu. Jej hlavičku pripojili anténkami na počítač. Po chvíľke sa na obrazovke objavila správa:\r\n"Nyní múžete počitač bez obav vypnout"', 176, 3.2, 4),
	(1008, 'Príde blondínka ku doktorovi a doktor jej hovorí:\r\n- Vyzlečte sa.\r\n- Ja sa hanbím.\r\n- Tak zhasnem svetlo.\r\n- Kde si mám dať šaty?\r\n- Tu k mojim.', 152, 2.93, 4),
	(1009, 'Blondína sa divo rúti po meste v novom aute. Zastaví ju policajt.\r\n"Neviete čítať, alebo nepoznáte čísla? Na značke bolo 40 km/h"\r\n"Čítať? Pri takej rýchlosti?"', 174, 3.01, 4),
	(1010, 'Vieš prečo nemôžu mať blondínky pracujúce v banke obedňajšiu prestávku?\r\nPretože by ich museli po obede znovu zaškoliť.', 132, 3.29, 4),
	(1011, 'Čo robí blondínka najčastejšie?\r\nNeviem...', 47, 3.26, 4),
	(1012, 'Sťažuje sa blondínka priateľke:\r\n- Môj manžel je taký sprostý. Predstav si, včera odchádzal na mesačné liečenie do kúpeľov a do batožiny si pribalil tridsať kondómov. On blbec si myslí, že ho budem každý deň navštevovať.', 245, 3.25, 4),
	(1013, 'Dve blondínky:\r\n- Vieš, že tvoj muž je homosexuál?\r\n- Chrapúň! A mne tvrdil, že je na chlapov!', 102, 2.57, 4),
	(1014, 'Stroskotajú tri blondínky na ostrove. Po dlhšom čase chytia zlatú rybku. Rybka im sľúbi, že ak ju pustia tak im splni 3 želania. Prvvá hovorí:\r\n" Chcem byt 10 krát múdrejšia."\r\nLusk. Stalo sa! Blondínka si postavilla loď a odišla. Druhá hovorí:\r\n" Chcem byť 100 krát múdrejšia."\r\nLusk. Stalo sa! Spravila si plachetnicu a odišla. Tretia hovorí:\r\n" Chcem byť múdra ako muž."\r\nLusk. Stalo sa! A odišla z ostrova po moste.', 448, 3.94, 4),
	(1015, 'Blondínka ide na vysokú školu a zobudí sa.', 46, 3.42, 4),
	(1016, 'Viete, ako blondínka oklame vlak?\r\nKúpi si lístok a ide pešo!', 65, 3, 4),
	(1017, 'Čo hľadá blondínka v banáne?\r\nBaterky!', 43, 3.22, 4),
	(1018, 'Ako si sadnú štyri blondínky na jednu stoličku?\r\nPrevrátia ju.', 67, 3.31, 4),
	(1019, 'Policajt zastaví blondínku a chce skontrolovať povinnú výbavú motorového vozidla. \r\n- Pani vodička, ukážte mi, prosím, trojuholník.\r\nBlondínka vyhrnie sukňu, stiahne nohavičky a radostne hovorí:\r\n- To je trojuholník, čo pán policajt!', 252, 3.2, 4),
	(1020, 'Rozprávajú sa dve blondínky. Prvá sa pýta druhej:\r\n- Si ešte panna?\r\n- Ešte nie.', 87, 3.35, 4),
	(1021, 'Viete prečo majú blondínky okolo pupku modriny?\r\nPretože existujú aj blondíni.', 84, 2.8, 4),
	(1022, 'Viete prečo sa blondínky tešia na Veľkú noc?\r\nLebo im šibe.', 65, 3.1, 4),
	(1023, 'Blondínka sa pýta na ulici:\r\n"Pane, prosím vás, koľko je hodín?"\r\n"Je štvrť na štyri."\r\nBlondínka len krúti očami a hovorí:\r\n"Viete, to je divné. Pýtam sa na to celý deň a vždy dostanem inú\r\nodpoveď."', 220, 2.98, 4),
	(1024, 'Prečo nosia blondínky úzke sukne?\r\nAby udržali nohy pri sebe.', 65, 3.05, 4),
	(1025, 'Čo má fľaša piva spoločného s blondínkou?\r\nObidve sú od krku nahor prázdne.', 84, 2.92, 4),
	(1026, 'Idú dve blondínky autom značky Škoda. Zrazu sa im pokazí. Jedna blondínka vystúpi, ide dopredu ku autu, otvorí ho a zhíkne:\r\n"Stratili sme motor!"\r\nDruhá ide dozadu ku autu otvorí ho a hovorí:\r\n"Nevadí, tu máme náhradný!"', 237, 2.95, 4),
	(1027, 'Prečo majú blondíny taky dlhý orgazmus?\r\nNo viete, kým im to dôjde...', 75, 2.95, 4),
	(1028, 'Stojí blondínka na zástavke, ide okolo muž a hovorí jej:\r\n"Milá slečna tu chodí autobus iba na sviatky."\r\n"To mám dneska šťastie mám, narodeniny."', 158, 3.26, 4),
	(1029, 'Učiteľka hovorí triede plnej blondíniek:\r\n- Vy ste úplne sprosté, 80% z vás nechám prepadnúť.\r\nBlondínky sa začnú smiať:\r\n- Ha, ha, toľko nás tu ani nie je.', 172, 3.04, 4),
	(1030, 'Blondínka ide v aute a je celá rozčúlená lebo už asi hodinu počúva len samé sprosté vtipy o blondínkach. Zrazu uvidí jednu blondínku, ktorá sa na pšeničnom poli  člnkuje. Vtedy vystúpi a začne jej nadávať: \r\n"Ty sprostá, kvôli takým ako si ty si z nás každý uťahuje, kebyže viem plávať tak k tebe prídem a takú ti strelím!"', 357, 3.08, 4),
	(1031, 'V lese stojí čarovné zrkadlo, ktoré keď pred ním niekto klame ho vcucne. Ide okolo brunetka a hovorí: \r\n"Ja si myslím, že som najkrajšia na svete!"\r\nZrkadlo ju vcucne. Ide okolo ryšavá a hovorí:\r\n"Ja si myslím, že som najmúdrejšia na svete!". A zrkadlo ju vcucne. Ide okolo blondínka a hovorí:\r\n"Ja si myslím..."\r\nA vcuc.', 341, 2.96, 4),
	(1032, 'Pýta sa ráno manžel blondínky:\r\n- Zlatko, priala by si si kávu do postele?\r\n- Radšej do šálky, miláčik!', 113, 3.04, 4),
	(1033, 'Doplazí sa blondínka k dverám a zaklope. Muž jej otvorí dvere a blondínka mu hovorí:\r\n- Prosím vás, dajte mi pohár vody lebo som taká smädná, že už ani neviem, kde budem spať!', 191, 2.99, 4),
	(1034, 'Dve blondíny sú každá na opačnej strane rieky. Prvá kričí :\r\n"Prosím nevieš ako sa dostanem na druhú stranu?"\r\n"Veď Ty si na druhej strane!"', 152, 3.08, 4),
	(1035, 'Čo robí blondínka pred oknom?\r\nPracuje na Windows.', 53, 3.04, 4),
	(1036, 'Prečo sa blondínka plazí po supermarkete?\r\nHľadá nízke ceny.', 66, 3.13, 4),
	(1037, 'Jak poznáte že s počítačem pracovala blondýna?\r\nNa monitoru jsou bílé čáry od kancelářské běloby.', 111, 2.96, 4),
	(1038, 'Čo má spoločné windows a blondínka?\r\nMajú rovnako múdre hlášky.', 72, 3.71, 4),
	(1039, 'Viete prečo blondínka vyhadzuje z okna hodiny?\r\nAby vedela, ako letí čas.', 77, 2.81, 4),
	(1040, 'Dve blondínky sa rozprávajú:\r\n- Tak čo, spravila si vodičák?\r\n- Ale nie, vyhodili ma.\r\n- Prečo?\r\n- Tak som si jazdila, až sme sa dostali do kruhového objazdu a tam bola tabuľa 30. Tak som to 30 krát obišla a predsa ma vyhodili.\r\n- A neprepočítala si sa?', 267, 3.15, 4),
	(1041, 'Príde blondínka ku psychiatrovi: \r\n- Prosím vás, mohli by ste mi zmerať môj inteligenčný kvóóóó- kvó- kvo- kvokvo...', 129, 3.46, 4),
	(1042, 'Prečo sa blondínky rady kurčuľujú na kolieskových korčuliach a ešte k tomu v plavkách?\r\nPretože si myslia, že majú o pár koliesok navyše a chcú to ukázať všetkým.', 181, 3.25, 4),
	(1043, 'Prečo blondína reve?\r\nPredvádza posledný výkrik módy.', 59, 3.18, 4),
	(1044, 'Viete prečo blondínky otvárajú mlieko priamo v obchode?\r\nPretože je na ňom napísané: Tu otvoriť.', 105, 3.14, 4),
	(1045, 'Prečo blondínky nemajú doma počítač?\r\nBoja sa myši.', 58, 3.16, 4),
	(1046, 'Pýta sa muž blondínky:\r\n"Si ešte panna?"\r\n"Nie, ja som vodnár."', 68, 3.12, 4),
	(1047, 'Príde blondínka do obchodu vo Viedni a hovorí:\r\n"Prosím si baterky." \r\n"Wie bitte?"\r\n"Čo ste blbý? Nie vybité, nové."', 125, 3.48, 4),
	(1048, 'Hotline: - Čo máte na monitore?\r\nBlondínka: - Kvetináč.\r\nHotline: - Tak som to nemyslel. Čo máte napísané na monitore?\r\nBlondínka: - Sony.', 148, 3.21, 4),
	(1049, 'Stretnú sa dve blondínky na ulici a jedna vraví:\r\n"Bola som na tehotenských testoch!" \r\n"A boli ťažké otázky?"', 118, 2.85, 4),
	(1050, 'Načo sú vtipy o blondínkach, keď brunetky ich nepochopia?', 61, 2.68, 4),
	(1051, 'Blondínka sa sťažuje kamoške:\r\n- Včera mi kamoška povedala, že som lesba. Tak ma nasrala, že som ju zhodila z postele.', 126, 2.73, 4),
	(1052, 'Príde blondína k doktorovi a stažuje sa:\r\n"Pán doktor mám obrovský problém a neviem čo sa deje. Stále počujem  hlasy, väčšinou ten istý, ale nikoho nevidim."\r\nA doktor sa jej pýta:\r\n"No a kedy sa Vám to stáva najčastejšie?"\r\n"Hm. No keď telefonujem!"', 270, 3.22, 4),
	(1053, 'Dve blondínky hrajú "Hádaj na čo myslím":\r\n- Je to vec?\r\n- Áno!\r\n- Dá sa s tým telefonovať?\r\n- Šibe ti, s popolníkom?', 128, 2.96, 4),
	(1054, 'Blondína telefonuje elektrikárovi:\r\n- Príďte, prosím, čo najrýchlejšie, v zásuvke nemám prúd.\r\nOn odpovedá:\r\n- Hmm, poistky máte nahodené? Svetlo vám svieti?\r\n- Áno, poistky budú nahodené, svetlo nám svieti. Musíte sem urýchlene príjsť, asi bude upchatý kábel.', 285, 3.04, 4),
	(1055, 'Viete prečo blondínka nemôže mať obedňajšiu prestávku?\r\nPretože by ju museli znova zaškolovať!', 105, 2.94, 4),
	(1056, 'Starý poštár odchádzal do dôchodku. Už roky roznášal po svojom rajóne poštu a tak ho všetci poznali. Prišiel jeho posledný pracovný deň. Ľudia sa s ním lúčili. Jedna rodina mu dala kľúčenku, druhá podarovala na pamiatku pero. Odrazu zazvonil pri jedných dverách, otvorila prekrásna sexi blondínka, vtiahla ho za ruku dovnútra, vyzliekla a strávili dve hodiny milovaním v tých najnemožnejších akrobatických polohách. Potom si dali sprchu, senzačné raňajky (vajíčko, slaninka, džús a všelijaké dobrôtky) a nakoniec mu blondínka dala 5 dolárov. Ohromený poštár sa pýta: \r\n- Ako je to možné, že sa ku mne takto krásne správate, čo sa stalo?\r\nA blondínka odpovedá: \r\n- Včera som povedala manželovi, že nás poštár odchádza do dôchodku, že by bolo dobré niečo mu dať na pamiatku. A manžel mi odpovedal "Ale, jebať ho, daj mu 5 dolárov. No a raňajky bol môj nápad.', 934, 3.64, 4),
	(1057, 'Zaseknú sa dve blondínky vo výťahu a jedna vraví tej druhej:\r\n"Zakrič o pomoc, ty máš silnejší hlas!"\r\n"Pomóc, pomóc, pomóc."\r\nChvíľu čakajú a druhá vraví:\r\n"Teraz zakričme spolu."\r\n"Spolu, spolu, spolu."', 224, 3.46, 4),
	(1058, 'Viete aký je rozdiel medzi sliepkou a blondínkou?\r\nTen, že sliepka sedí na vajciach kľudnejšie.', 101, 2.95, 4),
	(1059, 'Viete, prečo blondínka polieva počítač horúcou vodou? \r\nAby jej nezamrzol.', 80, 3.01, 4),
	(1060, 'Blondína v hoteli dychtivo kričí na recepčného.\r\n- Šéfe, ako že vám nefunguje výťah?\r\n- Drahá pani, výťah funguje perfektne, akurát že vy stojíte v telefónnej búdke.', 184, 3.26, 4),
	(1061, 'Prečo sa sa blondíny sprchujú s dáždnikom?\r\nAby sa nemuseli utierať.', 74, 3.08, 4),
	(1062, 'Blondínka nastúpi do električky. Po chvílke sa ozve divný zvuk. Niečo to blondínke pripomína, ale za nič na svete si nevie spomenúť, čo. Tak len stojí a načúva tomu známemu zvuku a okolo nej to len tak šumí. Zrazu sa jej prihovorí mladý muž:\r\n- Uhm, slečna, zvoní vám telefón.\r\n- Vážne? A ako viete, že je môj?\r\n- Lebo ho máte v nohavičkách a vibruje vám.', 388, 2.99, 4),
	(1063, 'Viete prečo nemôže blondína urobiť ľad ?\r\nPretože zabudla recept.', 72, 3.15, 4),
	(1064, 'Prečo blondína otvára pred pôrodom okno?\r\nAby mohol priletieť bocian.', 74, 3.15, 4),
	(1065, 'Čo vznikne, keď skrížime blondýnu so sibírskym haskym?\r\nSú dve varianty:\r\n1. blondýna odolná extrémne nízkym teplotám\r\n2. najhlúpejší pes záprahu', 161, 3.39, 4),
	(1066, 'Príde blondínka k lekárovi a hovorí: \r\n- Pán doktor, ja som asi veľmi chorá. Bolí ma celé telo! Aha!\r\nDotkne sa prstom kolena. \r\n- Aú! Alebo tu.\r\nDotkne sa prstom ucha. \r\n- Aú!\r\nDoktor hovorí: \r\n- Tak potom máte asi zlomený prst.', 243, 3.21, 4),
	(1067, 'Idú dve blondínky po púšti, uvidia ťavu a jedna druhej hovorí:\r\n- Ale zbili toho chudáka koňa!', 102, 3.04, 4),
	(1068, 'Prečo mladej blondínke stúplo sebavedomie, keď dosiahla svoj prvý orgazmus?\r\nLebo konečne v živote niečo dosiahla.', 122, 3.06, 4),
	(1069, 'Prečo blondínka nehrabe lístie?\r\nLebo by spadla zo stromu.', 61, 3.04, 4),
	(1070, 'Prečo má blondínka v piatok na večeru fazuľovú polievku?\r\nAby mohla mať v sobotu večer perličkový kúpeľ.', 116, 2.9, 4),
	(1071, 'Pýta sa bruneta blondíny:\r\n- Kam ideš s tou potápačskou výstrojou?\r\n- Ale... Kamoška si kúpila plávajúcu podlahu.', 123, 2.77, 4),
	(1072, 'Vieš čo robí blondínka v skrini?\r\nPočúva kabát!', 54, 2.71, 4),
	(1073, 'Tri ženy stoja pred rastlinou pravdy.Kto nepovie pravdu ,tak ju rastlina zožerie.Bruneta hovorí:\r\n"Mám najkrajšie nohy na svete" a rastlina ju zožrala.\r\nČiernovláska hovorí:"Som najkrajšia na svete" a rastlina ju zožrala.\r\nA blondína hovorí:"Ja si myslím..."a rastlina ju zožrala!!!', 297, 3.19, 4),
	(1074, 'Viete prečo blondína nevie vybrať z chladničky ľad?\r\nLebo stratila recept!', 79, 2.92, 4),
	(1075, 'Prečo blondínka nosí tričká s krátkym rukávom?\r\nAby vedela, kde má zohnúť ruku.', 89, 2.98, 4),
	(1076, 'Čo robí blondínka vo vykúpe kovového šrotu?\r\nPočúva metal.', 66, 2.91, 4),
	(1077, 'Blondínky sledujú televíziu. Idú správy, ukazujú muža, ktorý chce skočiť z paneláku a prvá hovorí druhej:\r\n"Stav sa zo mnou o 100 korún, že skočí."\r\n"Dobre, ale ja hovorím, že nie."\r\nChlap skočí a blondína hovorí druhej:\r\n"Vyhrala som, ale musím ti niečo povedať, ja som tie správy už videla a vedela som, že skočí."\r\n"Ja sa ti musím s niečim tiež priznať, ja som to tiež videla, ale neverila som, že skočí ešte raz."', 457, 3.39, 4),
	(1078, 'Víte proč chodí blondýnka s chlebem na záchod?\r\nKrmí tam přece WC kachničku!', 84, 2.78, 4),
	(1079, 'Viete ako presvedčíte blondínu v lietadle, ktorá sedí v rade pri okne, že to nie je jej miesto?\r\nJednoducho, poviete jej, že rada pri okne neletí do Hollywodu!', 167, 3.02, 4),
	(1080, 'Blondínka na prechádzke so psom stretne mestských policajtov. Tí sa pýtajú: \r\n- Slečna, prečo váš pes nemá košík?\r\nBlondínka: \r\n- Veď mi nejdeme na nákup.', 170, 3.15, 4),
	(1081, 'Blondínka kúpe svoje dieťa:\r\n- Mami, kedy si už kúpime novú vaňu?\r\n- Buď ticho a nevystrkuj hlavu z práčky!', 117, 3.32, 4),
	(1082, 'Blondínka sa pýta v kancelárii Športky.\r\n- O čo ide v tejto hre?\r\n- Musíte trafiť päť čísiel.\r\n- A z akej vzdialenosti?', 130, 3.46, 4),
	(1083, 'Príde blondína k doktorovi, že ju svrbí celé telo.\r\nLekár sa jej pýta:\r\n- Hovorí vám niečo sprcha?\r\n- Áno, hovorí, ale to pomáha tak na týždeň.', 159, 3.11, 4),
	(1084, 'Blondínka jde po parku a začne ji zvonit telefon. Blondínka zvedne telefon a zeptá se:\r\n"Čau mami jakto že víš, že sem v parku?"', 137, 3.15, 4),
	(1085, 'Príde prefarbená blondína na salaš a ide robiť biznis s bačom:\r\n"Bača, keď uhádnem, koľko máte oviec, môžem si jednu zobrať?"\r\n"No dobre, skús to."\r\nFalošná tmavovláska prezrie horizont a vyštekne:\r\n"395".\r\nBača uznanlivo pokýve hlavou, že OK, môže si jednu zobrať. Blondína schmatne ovcu a chce odísť, keď bača zahučí:\r\n"Hej, blondína, počkaj chvíľu."\r\n"Ako ste spoznali, že som blondína?"\r\n"Poviem Ti, keď mi vrátiš psa."', 464, 3.51, 4),
	(1086, 'Viete čo to znamená, keď je blondína zabalená do kalendára?\r\nNo predsa počúva rok!', 90, 3.02, 4),
	(1087, 'Vieš, ako spoznáš, že pri počítači bola blondínka?\r\nNechala pri myši kúsok syra.', 90, 3.01, 4),
	(1088, 'Viete, prečo nosí blondínka v daždi lodičky?\r\nAby sa neutopila.\n', 69, 3.07, 4),
	(1089, 'Prečo nevie blondínka napísať číslo 11?\r\nLebo nevie, ktorú jednotku má napísať ako prvú.', 99, 3.25, 4),
	(1090, 'Prečo blondínky nemôžu maľovať veľkonočné vajíčka?\r\nLebo sa im trasú ruky od vzrušenia.', 100, 3.08, 4),
	(1091, 'Blondínka má u seba milenca. Odrazu počuje, že ide jej manžel. Milencovi preto hovorí: \r\n- Ide manžel! Rýchlo vyskoč z okna! \r\n- Čo si sa zbláznila? Však sme na trinástom poschodí! \r\n- Nebuď poverčivý a skáč!  ', 229, 3.79, 4),
	(1092, '- Slečna, od zajtra je drahší benzín.\r\n- To nevadí, ja aj tak vždy kupujem za 200 korún.', 95, 2.81, 4),
	(1093, 'Blondínka lúšti krížovku:\r\n- Matka Romula a Rema na tri...\r\nPlavovláska sa chvíľu na zadanie pozerá a nakoniec napíše: VLK.', 134, 2.3, 4),
	(1094, 'Do obchodu vojde nahnevaná blondínka a predavačka sa jej pýta: \r\n- Čo si želáte? \r\n- Prišla som reklamovať túto konzervu. \r\n- A čo je s ňou? \r\n- Píše sa na nej, že vydrží štyri mesiace a ja som ju zjedla za päť minút.', 238, 3.07, 4),
	(1095, 'Prečo blondína pije len bielu kávu.\r\nLebo sa bojí, že by jej z čiernej zhnedli vlasy. ', 92, 2.9, 4),
	(1096, 'Prečo má vlastne blondína blonďavé vlasy?\r\nNiekto si to musí odniesť.', 76, 3.54, 4),
	(1097, 'Viete, koľko blondíniek je potrebných pri hre na skrývačku?\r\nJedna. ', 73, 2.65, 4),
	(1098, 'Idú dve blondínky nakupovať. V obchode so športovými potrebami jedna od radosti zhíkne a ukazuje na kopačky:\r\n- Pozri, to je úžasné, koľko opätkov majú tie topánky.\r\nA druhá na to:\r\n- Bože, také som vždy chcela.', 229, 2.71, 4),
	(1099, 'Vyhodia tri blondíny z baru. Dve z nich kričia na tretiu:\r\n- Ty koza, tri krát šš a nie tri krát šuch šuch!', 115, 2.98, 4),
	(1100, 'Príde blondínka do stánku a pýta sa predavača:\r\n- Prosím vás, koľko stojí jeden 12 korunový lístok?\n', 111, 3.17, 4),
	(1101, 'Viete prečo blondínky vyhadzujú do vzduchu hodinky?\r\nAby videli, ako rýchlo letí čas.', 91, 3.23, 4),
	(1102, 'Blondínka píše list z nemocnice: "Milý darca. Ďakujem ti za tvoje srdce a dúfam, že sa uzdravíš tak skoro ako ja."', 123, 3.23, 4),
	(1103, 'Prečo sa blondínka nehrá na PC? \r\nLebo sa bojí myši.', 57, 3.12, 4),
	(1104, 'Čo robí bruneta medzi dvoma blondínami?\r\nTlmočí.', 53, 3.14, 4),
	(1105, 'Viete prečo majú blondínky v topánkach napísané NP?\r\nNajprv prsty!', 72, 3.33, 4),
	(1106, 'Blondínka sa pýta:\r\n- A píše sa správne Irak alebo Irán?', 62, 3.16, 4),
	(1107, 'Hovorí blondína blondíne:\r\n"Včera som bola na tehotenskom teste."\r\n"A boli ťažké otázky?"', 97, 3.16, 4),
	(1108, 'Blondínka v obchode hovorí: \r\n- Prosím si presne taky istý sveter, ale ružový s modrými bodkami, s krátkymi rukávmi a pletený...', 138, 3.12, 4),
	(1109, 'Viete, prečo blondínky nosia krátke rukávy?\r\nPreto, aby vedeli kde sa im zohýba ruka.', 90, 3.01, 4),
	(1110, 'Blondínka si objednala pizzu. Čašník sa pýta:\r\n"Chcete ju rozrezať na šesť, alebo na dvanásť častí?"\r\n"Šesť prosím, dvanásť by som nezjedla."', 158, 3.14, 4),
	(1111, 'Blondínka kupuje nové auto a pýta sa: \r\n- Prosím vás, a je to rýchle auto?\r\n– Samozrejme, dosiahne rýchlosť 240 km za hodinu!\r\n– Teraz kecáte. Hodina toľko kilometrov nemá!', 187, 3.07, 4),
	(1112, 'Sedí blondínka na kraji Dunaja a plače. Príde k nej policajt a pýta sa jej:\r\n- Slečna, čo sa vám stalo?\r\nA blondínka hovorí:\r\n- Ále, pred chvíľou sa mi tu utopila kamarátka.\r\nPolicajt:\r\n- Tak to vás chápem.\r\nBlondínka:\r\n- Ale ja to nechápem, veď mala lodičky.', 279, 3.43, 4),
	(1113, 'Viete, že sa má zaviesť nová dopravná značka pre blondínky?\r\nKoniec kruhového objazdu.', 94, 2.7, 4),
	(1114, 'Viete prečo blondínky nemajú v kúpeľni dvere?\r\nAby ich nemohol nikto špehovať cez kľúčovú dierku.', 108, 2.64, 4),
	(1115, 'Prečo blondínka nevie napočítať do 70?\r\nLebo pri 69-ine má plné ústa.', 77, 3.23, 4),
	(1116, 'Ide blondína na škodovke a dôjde jej benzín. Nevediac o tom otvorí prednú kapotu a zalomí rukami:\r\n- Preboha, veď mi ukradli motor!\r\nVtom ide okolo druhá blondína na škodovke, zastaví, vystúpi, vypočuje si kolegyňu, otvorí zadnú kapotu a s potešením vraví:\r\n- Máte šťastie, náhodou tu mám rezervný motor!', 330, 3.17, 4),
	(1117, 'Čo urobi blondínka, keď ráno vstane?\r\nOblečie sa a ide domov.', 66, 3.38, 4),
	(1118, 'Zrazia sa dve blondínky a jedna hovorí druhej.\r\n"No jasne, žena za volantom."', 80, 3.23, 4),
	(1119, 'Rozprávajú sa dve blondíny:\r\n- Predstav si, minule som mala výron na členku.\r\n- Áno? A čo si s tým robila?\r\n- No, išla som k lekárovi a ten mi to obviazal.\r\n- Zaujímavé, ja som mala minule výron na bruchu a len som si to utrela.', 241, 3.23, 4),
	(1120, 'Sťažuje sa blondína po dovolenke:\r\n"Ten idiotský foťák mi spravil 36 záberov pravého oka!"', 98, 3.31, 4),
	(1121, 'Blondínka príde do spovedelnice a pán farár sa jej pýta:\r\n- No, koľko máš hriechov?\r\n- Ále, zmestilo sa mi to na dve diskety!', 134, 3.32, 4),
	(1122, 'Čo urobí blondína, keď jej priateľ povie, že potrebuje viac priestoru?\r\nDá si vybrať mandle.', 100, 3.16, 4),
	(1123, 'Viete prečo má blondínka na stene napísané: ÓOOOOOHHHHHHHHH?\r\nAby pri orgazme nezabudla text.', 99, 3.18, 4),
	(1124, 'Prečo vyhadzuje blondínka hodinky z okna?\r\nAby videla, ako ten čas letí.', 76, 3.14, 4),
	(1125, 'Viete, aký je rozdiel medzi blondínkou a chappi?\r\nV chappi sú aj mozočky.', 77, 3.06, 4),
	(1126, 'Viete prečo jedia blondínky Whiskas?\r\nLebo chcú byť kočky!', 63, 3.01, 4),
	(1127, 'Čo to znamená, keď má blondína pramienok tmavých vlasov?\r\nNádej.', 71, 3.36, 4),
	(1128, 'Pýta sa šéf pri nástupe do zamestnania blondínky:\r\n"A koľko máte, prosím vás IQ?"\r\n"A kde máte namysli, v páse alebo prsia?"', 135, 3.23, 4),
	(1129, 'V čom sa zhodujú blondínka a WIN9x?\r\n"PLUG&PLAY;"', 52, 3.27, 4),
	(1130, 'Vieš, prečo v kine sedí blondínka vždy v prvom rade?!?\r\nLebo ten film chce vidieť  ako prvá!!!', 101, 3.26, 4),
	(1131, 'Viete, prečo majú blondínky menštruáciu?\r\nZaslúžia si ju.', 64, 3.16, 4),
	(1132, 'Hrajú dve blondínky "hádaj na čo myslím". Prvá sa pýta:\r\n- Je to vec?\r\nDruha odpovedá:\r\n- Áno.\r\nPrvá pokračuje ďalej:\r\n- Dá sa s tým telefonovať?\r\nDruha odpovedá:\r\n- Čo si šialená, s popolníkom?!', 215, 3.18, 4),
	(1133, 'Blondína dostala otázku na súťaži krásy:\r\n- Keby ste mohli hovoriť s akýmkoľvek mysliteľom 20. storočia, živým alebo mŕtvym, koho by ste si vybrali?\r\n- Asi živého.', 179, 3.35, 4),
	(1134, 'Prečo je blondínka nešťastná na dámskom WC?\r\nLebo jej nemá kto vyzliecť nohavice!', 89, 3.14, 4),
	(1135, 'Viete prečo má blondínka mozog veľkosti hlavičky špendlíka?\r\nLebo jej napuchol.', 86, 3.38, 4),
	(1136, 'Prečo sa blondínka zblázni po troch rokoch v erotickom bare?\r\nLebo zistí, že ostatné to robia za peniaze.', 111, 3.38, 4),
	(1137, 'Ide blondínka po lúke a zrazu zbadá, že za ňou beží býk. Tak začne bežať. Po chvíli sa zastaví a hovorí:\r\n- Radšej teľa ako zápal pľúc.              ', 168, 3.8, 4),
	(1138, 'Ako sa povie blondínke medzi dvoma brunetami?\r\nMentálny blok.              ', 77, 3.67, 4),
	(1139, 'Blondína volá priateľa mobilom a ozve sa jej ženský hlas:\r\n- Účastník momentálne nie je dostupný, zavolajte neskôr prosím.\r\n- A tebe je dostupný, ty mizerná štetka?              ', 193, 3.88, 4),
	(1140, 'Zaľúbená blondína hovorí mládencovi:\r\n- Vidíš, drahý, ako sa milujú tie dve vtáčatká na tom konári?\r\nMladík nadšene:\r\n- Robme to aj my!\r\nBlondína:\r\n- A čo keď sa ten konár zlomí?              ', 213, 3.75, 4),
	(1141, 'Viete  prečo  chodi  blondika  von  oknom?\r\nLebo za derami sú vianoce.              ', 86, 3.36, 4),
	(1142, 'Ide mama blondínka zo synom vlakom. Po desiatich minútach vlak zastane a syn sa spýta: \r\n- mami prečo sme zastali? \r\nA mama mu odpovie: \r\n- Asi sme dostali defekt.              ', 181, 3.75, 4),
	(1143, 'Ako zabijete blondínku? Dovediete ju na strechu obchodu a poviete aby skočila nakúpiť.               ', 105, 3.27, 4),
	(1144, 'Idú dve blondínky po ulici a jedna hovorí druhej.\r\n"Pozri sa na toho psa s jedným okom."\r\nDruhá si zakryje jedno oko a hovorí:\r\n"Kde?"\n', 141, 3.62, 4),
	(1145, 'Dve blondínky sa rozprávajú:\r\n"Kúpila som si švihadlo."\r\n"Prosím ťa a načo ti bude?"\r\n"Urobila som si z neho troje tangáče a ešte mi ostali dva vibrátory."              ', 181, 3.44, 4),
	(1146, 'Keď naraz vyskočia z okna blondínka a brunetka, ktorá z nich skôr dopadne?\r\nBrunetka, lebo blondínka na prvom poschodí zablúdi.\r\nDve blondínky sa rozprávajú "Dnes som prišla o panenstvo."\r\n"A bolo to z lásky alebo pre peniaze?"\r\n"Podľa mňa z lásky, však čo už dnes kúpiš za tisícku."              ', 319, 3, 4),
	(1147, 'Kedy vymení blondína vodu rybám v akvárku?\r\nPočká pokiaľ ju všetku nevypijú!              ', 99, 3.67, 4),
	(1148, 'Sekretárka stojí pri okne...\r\nPríde riaditeľ a zozadu ju chytí za prsia.\r\n"Pán riaditeľ, čo to robíte?"\r\n"Hrám sa, že ste rádio a týmito gombíčkami hľadám stanicu Rakúsko 3."\r\nSekretárka siahne rukou dozadu a vraví:\r\n"Pán riaditeľ, na túto anténu nechytíte ani Twist."              ', 307, 3.99, 4),
	(1149, 'Príde blondínka k doktorovi.\r\nDoktor: "Vyzlečte sa."\r\nPo chvíli sa pýta doktor: "Už ste?"\r\nBlondínka odpovie: "Áno a vy?"              ', 143, 4.11, 4),
	(1150, 'Do baru vojde muž s blonďatou priateľkou a objedná si:\r\n"Jedno Malibu."\r\nBlondínka k čašníkovi:\r\n"A pre mňa veľký Bu."              ', 143, 4, 4),
	(1151, 'Prečo blondína zamrzla v letnom kine?\r\nChcela vidieť film: Cez zimu zavreté!              ', 94, 3.4, 4),
	(1152, 'Blondínka na pláži:\r\n"Mám plnú hlavu piesku."\r\nTmavovláska:\r\n"Zaujímavé, mne sa to dostalo len do vlasov."              ', 128, 3, 4),
	(1153, 'Blondína listuje  v telefónnom zozname:\r\n"Novák, Novák, Novák... Teda, to je neuveriteľné, koľko ten človek môže mať telefónov!"              ', 155, 2.75, 4),
	(1154, 'Idú dve blondínky k vlaku po nástupišti a jedna sa pýta sprievodcu:\r\n"Prosím vás, dovezie ma ten vlak do Prahy?"\r\n"Nie, slečna, ľutujem..." odpovie sprievodca.\r\nTa druhá našpúli pery, napne hruď a pýta sa:\r\n"A mňa?"              ', 244, 3.63, 4),
	(1155, 'Príde blonďatá slečna do autoservisu:\r\n"Prosila by som vymeniť takú tú tyčinku na meranie oleja v motore, tá stará už na ten olej nedočiahne!"              ', 168, 3.43, 4),
	(1156, 'Blondínka si kupuje nové auto a pýta sa predavača:\r\n"Prosím vás, je to rýchle auto?"\r\n"Samozrejme, 240 km za hodinu."\r\n"Nekecajte, hodina toľko kilometrov nemá!"              ', 184, 3.33, 4),
	(1157, 'Príde blondína na políciu:\r\n"Okradli ma, okradli ma, ukradli mi kabelku!"\r\n"Prosím vás, nekričte. Ako je možné, že ste necítili, ako vás okradli."\r\n"Ale cítila, cítila, ale netušila som, že druhou rukou okradnú!"              ', 242, 3.86, 4),
	(1158, 'Viete čo znamená keď ma blondínka pramienok tmavých vlasov?               Nádej.              ', 100, 3.2, 4),
	(1159, 'Príde blondínka s brunetkou do kaviarne a brunetka hovorí: "Prosím Vás, doneste nám dve kávy." \r\nA blondínka na to: "Máš pravdu, ja si dám tiež dve."              ', 175, 3.8, 4),
	(1160, 'Blondína sa divo rúti po meste v novom aute. Zastaví ju policajt.\r\n"Neviete čítať, alebo nepoznáte čísla? Na značke bolo 40 km/h."\r\n"Čítať? Pri takej rýchlosti...?"              ', 192, 3.6, 4),
	(1161, 'Ako sa blondína dostane k norkovému kožuchu?\r\nTak ako norka k mladým.              ', 87, 3.83, 4),
	(1162, 'Šéf blondínke:\r\n"Váš nástupný plat je 7000 Sk.\r\nNeskôr môžete mať plat 12000 Sk."\r\nBlondínka:\r\n"Tak ja teda prídem radšej neskôr."              ', 159, 2.89, 4),
	(1163, 'Pýta sa šéf blondínky pri nástupe do zamestnania:\r\n"Koľko máte, prosím vás, IQ?"\r\n"A kde myslíte, v páse alebo na prsiach?"              ', 148, 3.67, 4),
	(1164, 'Hrajú blondínka s brunetkou futbal. Brunetka dá gól a hovorí:\r\n"Jedna nula."\r\nHrajú ďalej, gól sa podarí dať aj blondínke a tá hovorí:\r\n"Druhá nula."              ', 177, 3.83, 4),
	(1165, 'Viete, aký je rozdiel medzi sliepkou\r\na blondínkou?\r\nSliepka sedí na vajciach pokojnejšie.              ', 108, 3, 4),
	(1166, 'Idú dve blondínky po ulici a jedna hovorí:\r\n"Vieš, že tento rok budú Vianoce v piatok?"\r\nDruhá na to:\r\n"Dúfajme, že nie trinásteho!"              ', 156, 3.47, 4),
	(1167, 'Dve blondínky idú spolu vo výťahu. Náhle sa výťah zastaví. Po chvíli jedna začne volať o pomoc. Potom hovorí tej druhej:\r\n"Počuj, nebude lepšie, keď budeme kričať spolu."              ', 201, 2.44, 4),
	(1168, 'Prečo majú blondínky v tele o 200 kostí viac ako bežný človek ?\r\nLebo majú mechanický mozog.              ', 115, 3.33, 4),
	(1169, 'Stretnú sa dve blondínky a jedna sa pýta druhej:\r\n"Kde pracuješ?"\r\n"Robím sekretárku."\r\n"A čo to je za práca?"\r\n"No, prídem tam, urobím šéfovi kávu, pobavíme sa, niečo napíšem, potom idem na obed, zasa mu spravím kávu, pobavíme sa, niečo napíšem a idem domov. A ty?"\r\n"Ja tiež robím šľapku, ale nemám toľko toho písania."              ', 365, 3.58, 4),
	(1170, 'Prečo blondínky nevaria sáčkové polievky?\r\nPretože ešte stále neprišli na to, ako naliať liter vody do sáčku.              ', 135, 4, 4),
	(1171, 'Viete prečo sa blondínky plazia v obchode?\r\nPreto lebo hľadajú nízke ceny.              ', 93, 3, 4),
	(1172, 'Viete čo robí 10 blondíniek v strede Atlantického oceána? Hľadajú Leonarda di Capria.              ', 106, 3.75, 4),
	(1173, 'Ako blondínka zabije vtáka?\r\nZhodí ho z útesu!              ', 64, 3.4, 4),
	(1174, 'Viete kedy je blondínka mudrejšia ako počítač?\r\nKeď je počítač vypnutý.              ', 95, 3.67, 4),
	(1175, 'Príde blondínka do nemeckého obchodu a pýta si:\r\n- Prosím si dve tužkové baterky.\r\nPredavač na to: \r\n- Wie bitte? \r\nA blondínka hovorí: \r\n- nie vybité, ale nabité, ty somár!               ', 201, 3.56, 4),
	(1176, 'Predavač vbehne na pumpu a hovorí kolegovi: Poď rýchlo von, je tam blondínka a snaží sa s drôtom otvoriť zabuchnuté auto. A druhý na to: No a čo má byť? No, v auto sedí druhá a radí jej: Doprava, ešte, ešte, nie teraz doľava!              ', 259, 3.4, 4),
	(1177, 'Príde muž domov a vidí svoju ženu, blondínku plakať. Pýta sa jej čo sa stalo. Žena na to: \r\n- padol mi lad na zem, opláchla som ho teplou vodou a potom som ho nemohla nájsť.              ', 199, 3.33, 4),
	(1178, 'Viete prečo blondínka nechala pri počítači kúsok syra?\r\nAby myš nehladovala.              ', 97, 3.64, 4),
	(1179, 'Prečo dávaju blondínky počítač k radiátoru?\r\nAby nezamrzal.              ', 80, 2.7, 4),
	(1180, 'Ako blondínka zabije kapra? Utopí ho!              ', 53, 3.67, 4),
	(1181, 'Viete prečo nosia blondínky do práce kvetináč?\r\nChcú sa presadiť!              ', 86, 3.68, 4),
	(1182, 'Viete ako najjednoduchšie presvedčíte blondínku aby sa za vás vydala?\nPoviete jej, že s vami čaká dieťa. \n', 115, 3.86, 4),
	(1183, 'Blondínka v sexshope kupuje vibrátor.\n"Prosím si ten čierny, ten biely aj ten červený!"\n "Biely a čierny vám predáme ale ten hasiaci prístroj nie ..."\n', 161, 3.5, 4),
	(1184, 'Prečo nosia blondínky nohavičky?\nAby mali členky v teple.\n', 62, 3, 4),
	(1185, 'Idú blondínky v aute \na zastanú pred semaforom, blondínka pri volante vraví:\n"Pozrite na tú krásnu červenú farbu, tá je ale nádherná!"\n"A pozrite na tú oranžovú, tá je ešte krajšia..."\n"Aha zelená tá je najkrajšia..."\n"Aha červená, tú sme už videli .... poďme!"\n', 288, 3.95, 4),
	(1186, 'Čo spraví muž, keď po ňom hodí blondínka granát? \nOdistí ho a hodí späť.              ', 98, 3.52, 4),
	(1187, 'Ide blondínka okolo ohrady s býkmi. Jeden z nich sa zrazu rozbehne za ňou. Blondínka beží 1., 2., 3. kilometer a keď už nevládze, povie: ”Kašlem na to, radšej teľa ako zápal pľúc.”              ', 213, 3, 4),
	(1188, 'Príde blondínka do obchodu a pýta si jeden jam.\r\nPredavač jej hovorí, že sa tomu nehovorí jam ale džem.\r\nBlondína hovorí: aha, tak si prosím ešte jeden džahodový džogurt...\n', 188, 3, 4),
	(1189, 'Plavia sa dve blondínky na kolese. Jedna spadne do vody a utopí sa. Druhá sa len prizerá a keď je po všetkom, tak hovorí:\r\n”Teda mňa švihne! A ja som si myslela, že sa neutopí, veď mala lodičky!”              ', 226, 3.62, 4),
	(1190, 'Blondínka vyplňuje dotazník a narazí na kolonku ”pohlavie”. Po krátkej úvahe napíše: ”Ryšavé.”              ', 126, 3.43, 4),
	(1191, 'Blondínka príde do drogérie:\r\n”Máte niečo proti moliam?”\r\n”Naftalínové guličky.”\r\n”Prosím si desať.\r\nDruhý deň príde tá istá blondínka a kúpi ešte 20 guličiek, tretí deň 60. Predavačka sa pýta:\r\n”Načo toľko naftalínu?”\r\n”Viete, aké je ťažké trafiť takú molu tak malou guličkou?”              ', 343, 3.4, 4),
	(1192, 'Príde blondínka do drogérie a pýta sa predavača:\r\n”Predávate aj prezervatívy veľkosti XXL?”\r\n”Samozrejme, koľko si ich želáte?”\r\n”Ani jeden, ale mohla by som tu počkať, kým si ich príde niekto kúpiť?”              ', 243, 3.73, 4),
	(1193, 'Gynekológ prezrie blondínku a vraví jej:\r\n”Pani, ste tehotná už dva mesiace...”\r\n”Ale kdeže, pán doktor. Ja som Trkalová a už tri roky!”              ', 167, 3, 4),
	(1194, 'Príde zúfalá blondínka po natankovatí za pumpárom a prosí o pomoc:\r\n”Pán pumpár, zabuchla som si v aute kľúče. Nemohli by ste mi s tým nejako pomôcť?”\r\n”Dám vám háčik a s tým si to auto otvoríte.”\r\n”A nemohli by ste mi to ísť otvoriť vy?”\r\n”Bohužiaľ, ale musím zostať za kasou.”\r\nNato blondínka išla ku svojmu autu. V tom vošiel na pumpu pán, ktorý sa strašne smial. Pumpár sa ho pýta:\r\n”Čo sa stalo?”\r\n”Ále, to ste ešte nevideli. Vonku je blondínka a snaží sa otvoriť auto háčikom.”\r\n”No a čo? Však to som jej poradil ja.”\r\n”No, ale v nútri v aute sedí ešte jedna, ktorá jej radí: doprava, doľava, ešte kúsok...”              ', 714, 4.29, 4),
	(1195, 'Príde Zuzana, ktorá je mimochodom blondínka k doktorovi.\r\n”No, čo ťa bolí, Zuzanka?”\r\n”Ach, pán doktor, všetko. Všetko od zubov až po jazyk.”              ', 173, 3.75, 4),
	(1196, 'Chlapík sa v bare zastaví pri troch blondínkach a hovorí jednej z nich:\r\n”Chcete počuť vtip o blondínkach?”\r\nJedna z nich nato:\r\n”Skôr ako začneš hovoriť, mal by si vedieť, že mám 180 cm, 100 kg a som bývalá kulturistka. Táto druhá blondínka má 184 cm, 120 kg a je to bývalá zápasníčka a posledná z nás má 190 cm, 140 kg a je to bývalá boxerka. Tak čo? Chceš nám ten vtip ešte povedať?”\r\nChlapík: ”Vlastne ani nie, nechce sa mi ho vysvetľovať trikrát!”              ', 517, 3.73, 4),
	(1197, 'Blondínka telefonuje:\r\n”Je tam drogéria?”\r\n”Nie.”\r\n”Tak načo zdvíhate telefón...?”              ', 113, 2.43, 4),
	(1198, 'Aké vitamíny chýbajú blondínkam? No predsa I a Q.              ', 68, 3.8, 4),
	(1199, 'Blondínka je s mužom na koncerte vážnej hudby. Po 20 minútach vraví:\r\n"Drahý, keď ten pán tie husle konečne prereže, pôjdeme domov?"              ', 158, 3, 4),
	(1200, 'Blondínka zdvihne zvoniaci telefón:\r\n”Haló... haló!”\r\nOzve sa hlboký hlas:\r\n”Viem, že chceš, aby som sa u teba objavil, odniesol ťa do spálne, vyzliekol, bozkával celé tvoje telo a vášnivo sa s tebou miloval...”\r\n”Hi hi, vy ste dobrý... To vážne, toto všetko viete podľa dvoch haló?”              ', 328, 3.4, 4),
	(1201, 'Pred skúškou na vodičák sa blondínka pýta inštruktora:\r\n”Pán inštruktor, keď mi dôjde palivo a rozhodnem sa ísť ďalej, neuškodí to motoru?”              ', 173, 3, 4),
	(1202, 'Do baru vojde muž s blondínkou a objednáva si:\r\n”Jedenkrát Malibu.”\r\nBlondínka vraví čašníkovi:\r\n”A mne jedenkrát veľký Bu.”              ', 158, 3.67, 4),
	(1203, 'Mama vraví blondínke:\r\n”Kde si sa flákala? Už je jedenásť hodín! Okamžite sa vyzleč a do postele!”\r\nBlondínka na to:\r\n”Už zase?!”\n', 149, 3.88, 4),
	(1204, 'Vráti sa muž domov a vidí svoju ženu - blondínku, ako prikladá na stenu mokré uteráky a pýta sa:\r\n”Prečo namáčaš tú stenu?”\r\n”Ale, doktor mi odporučil, aby som dávala studené obklady na miesto, kde som sa udrela.”              ', 252, 3.67, 4),
	(1205, '\r\nMuž príde domov a nájde svoju blond manželku ako sedí v kuchyni a plače. Na otázku, čo sa jej stalo ona odpovedá:\r\n”Padli mi kocky ľadu na podlahu, tak som ich opláchla teplou vodou a teraz ich nemôžem nájsť!”              ', 244, 3.82, 4),
	(1206, '-Viete prečo keď blondínka kaká, kaká na dve kôpky?\r\n-Lebo nosí tangáče!              ', 95, 3.4, 4),
	(1207, 'Policajt klope na dvere blondínky. Blondínka sa pýta:\r\n”Kto je tam?”\r\n”Ja.” odpovedá policajt.\r\n”Akože ja? Veď ja som predsa tu!” zamyslí sa blondínka.              ', 185, 3.2, 4),
	(1208, 'Viete prečo stojí v zime blondínka v rohu?\r\nLebo je tam 90 stupňov.              ', 85, 3.67, 4),
	(1209, 'Príde blondínka pred bránu parku a číta si nápis: ”Vstup len so psom na vodítku!” Zamyslí sa a hovorí:\r\n”Špagát by som aj našla, ale kde zoberiem toho psa?”\r\nPríde blondínka k policajtovi, ktorý stojí pred policajnou stanicou a pýta sa ho:\r\n”Prosím vás, neviete, kde je tu policajná stanica?”\r\nPolicajt sa na ňu prekvapene pozrie a povie:\r\n”Prečítajte mi názov tej budovy za mnou.”\r\nBlondínka sa otočí, prečíta názov ”Policajná stanica”, obráti sa k policajtovi a spýta sa ho:\r\n”A teraz mi to už poviete?”              ', 577, 3.17, 4),
	(1210, 'Hovorí jedna blondínka druhej:\r\n”Môj pes klame.”\r\n”To nemôže byť pravda, psi predsa nevedia klamať!” namieta druhá.\r\n”Tak sa pozri! Dunčo, ako robí mačička?”\r\n”Hav, hav!”\r\n”No vidíš!?”\n', 219, 3.29, 4),
	(1211, 'Prečo chdí blondínka popri lekárni po špičkách?\r\nAby nezobudila lieky na spanie.              ', 101, 3, 4),
	(1212, 'Sexy blondínka v super krátkej minisukni sedí za barovým pultom a pije kávu. Po čase chce zaplatiť a tak zavolá na barmana:\r\n”Mám jednu malú čiernu...”\r\n”To vidím!” odpovedá barman.\r\n”...a stojí?” dokončí otázku blondínka.\r\n”Všetkým naokolo!”              ', 292, 4.03, 4),
	(1213, 'Policajt zastaví mladú blonďavú vodičku a vraví:\r\n”Slečna, neviete, čo znamená táto dopravná značka?”\r\n”Neviem, ale opýtajte sa tamto v trafike, ten dedo vie všetko možné.”              ', 210, 3, 4),
	(1214, 'Rozprávajú sa dve blondínky:\r\n-Ak uhádneš koľko mám lakov dám ti oba.\r\n-Druhá na to: Tri?               ', 113, 3.71, 4),
	(1215, 'Blondínka má u seba milenca. Odrazu počuje, že ide jej manžel. Milencovi preto hovorí:\r\n”Ide manžel! Rýchlo vyskoč z okna!”\r\n”Čo si sa zbláznila? Však sme na trinástom poschodí!”\r\n”Nebuď poverčivý a skáč!”              ', 250, 3.5, 4),
	(1216, 'Blondínka sa pýta v stávkovej kancelárii Športky.\r\n”O čo ide v tejto hre?”\r\n”Musíte trafiť päť čísel.”\r\n”A z akej vzdialenosti?”              ', 166, 3.85, 4),
	(1217, 'Blondínka na záchode:\r\n”Óch, tu je ale mužov! A to sem nechodia žiadne ženy?”\r\n”Nechodia. Ste na pánskych.”              ', 136, 2.6, 4),
	(1218, 'Blondínka sa rúti na aute. Narazí do stromu. Vystúpi a hovorí:\r\n”Však som trúbila.”              ', 108, 3.87, 4),
	(1219, 'Blondínka kupuje nové auto a pýta sa:\r\n”Prosím vás, je to rýchle auto?”\r\n”Samozrejme, dosiahne rýchlosť 240 km za hodinu!”\r\n”Teraz kecáte. Hodina toľko kilometrov nemá!”              ', 206, 3.14, 4),
	(1220, 'Dcéra blondínka hovorí svojej mame blondínke:\r\n”Nezabudni, že keď budeš nabudúce v spoločnosti hovoriť o našom veku, musí byť medzi nami minimálne 9 mesiacov rozdiel!”              ', 199, 3.67, 4),
	(1221, 'Do obchodu vojde nahnevaná blondínka a predavačka sa jej pýta:\r\n”Čo si želáte?”\r\n”Prišla som reklamovať túto konzervu.”\r\n”A čo je s ňou?”\r\n”Píše sa na nej, že vydrží štyri mesiace a ja som ju zjedla za päť minút.”              ', 264, 3.2, 4),
	(1222, 'Blondínka u zverolekára:\r\n”Pán doktor, môj psík je stále chorý, nežerie, nežerie a nežerie!”\r\n”Slečna, koľkokrát vám mám opakovať, že ani žrať nebude, pretože je vypchatý a vypchatý a vypchatý!”              ', 239, 4, 4),
	(1223, 'Pumpár informuje blodnínku:\r\n”Slečna, od zajtra je drahší benzín.”\r\n”To nevadí, ja aj tak vždy kupujem za 200 korún.”              ', 148, 3.8, 4),
	(1224, 'Blondínka vyplňuje dotazník.\r\nOtázka: Máte trvalý vzťah?\r\nOdpoveď: Dnes nie!              ', 98, 3.4, 4),
	(1225, 'Príde blondínka do reštaurácie a objedná si pizzu. O chvíľu sa časňík pýta: \r\n-Mám vám ju rozkrájať na štyri, alebo osem kúskov?\r\n-No.. Stačia štyri. Osem bysom nezvládla.              ', 205, 2.67, 4),
	(1226, 'Pýta sa chlapček svojej blonďatej mamičky:\r\n”Mami, čo je to mozog?”\r\n”Daj mi pokoj s hlúpymi otázkami, ja mám v hlave úplne iné veci!”              ', 166, 3.29, 4),
	(1227, 'Dve blondínky hrajú hru ”hádaj na čo myslím”. Prvá sa pýta:\r\n”Je to vec?”\r\nDruha odpovedá:\r\n”Áno.”\r\nPrvá pokračuje ďalej:\r\n”Dá sa s tým telefonovať?”\r\nDruha odpovedá:\r\n”Čo si šialená, s popolníkom?! ”              ', 254, 3.5, 4),
	(1228, 'Volá blondína na Hotline: \r\n"Ten váš program mi stále píše Vložte disketu, a ja neviem, čo urobiť.˝ \r\n"No a vložila ste disketu?˝ \r\n"To ma nenapadlo...˝              ', 180, 3.25, 4),
	(1229, 'Čo si pomyslí blondýna keď uvidí na\r\nzemi banánovú šupku?\r\n-Bože, zase spadnem!              ', 102, 3.67, 4),
	(1230, 'Blondína hrá futbal s brunetou. Brunetka dá gól a kričí:\r\n”Jedna nula, jedna nula!”\r\nPo chvíli dá gól aj blondína a tiež kričí:\r\n”Dve nuly, dve nuly!””              ', 188, 3, 4),
	(1231, 'Dve blondíny stoja na letisku pri pokladni a prvá sa pýta:\r\n”Tamto lietadlo ma prepraví do Viedne?”\r\n”Nie.”\r\nA druhá blondína sa pýta:\r\n”A mňa?”              ', 178, 3.6, 4),
	(1232, 'Policajt vidí ísť po ceste nádherné športové červené auto. Nedalo mu to a zastavil ho. Vystúpila z neho prekrásna dlhonohá a prsnatá blondínka. Policajt si od nej vypýtal doklady a spojil sa s dispečingom, či to auto nie je kradnuté.\r\n”Sedí v ňom taká nenormálne krásna blondínka?” opýtal sa dispečer.\r\n”Áno”\r\n”Vráť jej doklady a stiahni si nohavice.”\r\n”...ale to predsa...”\r\n”Nestaraj sa a urob čo ti hovorím.”\r\nPolicajt vrátil blondínke doklady, poodstúpil od auta a stiahol si nohavice.\r\n”Pre boha, zasa dychová skúška? Dnes už tretia!” zvolala blondínka.               ', 636, 4.19, 4),
	(1233, 'Deň pred vodičskými skúškami sa pýta blondínka inštruktora:\r\n”Keď budem mať napríklad prázdnu nádrž a rozhodnem sa pokračovať v jazde, nepoškodí mi to motor?”              ', 194, 3.4, 4),
	(1234, 'Prečo blondínka tancuje pred  semafórom? Pretože si myslí, že  je diskotéka!              ', 97, 3.33, 4),
	(1235, 'Kúpi si blondinka vibrátor, zapne ho a vraví "Netras sa aj ja to robim po prvy krát"              ', 102, 4.01, 4),
	(1236, 'Príde blondína k doktorovi a sťažuje sa:\r\n”Pán doktor, mám obrovský problém a neviem čo sa deje. Stále počujem hlasy, väčšinou ten istý, ale nikoho nevidím.”\r\nA doktor sa jej pýta:\r\n”No a kedy sa vám to stáva najčastejšie?”\r\n”Hm, no keď telefonujem!”              ', 298, 4, 4),
	(1237, 'Pýta sa ráno manžel blondínky:\r\n”Zlatko, priala by si si kávu do postele?”\r\n”Radšej do šálky, miláčik!”              ', 135, 3.86, 4),
	(1238, 'Blondínka dostala otázku na súťaži krásy:\r\n”Keby ste mohli hovoriť s akýmkoľvek mysliteľom 20. storočia, živým alebo mŕtvym, koho by ste si vybrali?”\r\n”Asi živého.”              ', 202, 3.67, 4),
	(1239, 'Príde blondínka k psychológovi a vraví:\r\n”Pán doktor, mohli by ste mi odmerať môj inteligenčný kvó, kvo kvo kvó...”              ', 144, 3, 4),
	(1240, 'Muž požiada blondínku letušku v lietadle o pohár vína, keď \r\nmu ho blondínka donesie, on jej poďakuje a povie:\r\n”Vy ste rybka.”\r\nBlondínka sa usmeje a odíde preč a začne rozmýšľať.\r\n”Prečo mi povedal, že som rybka? Rybka je aj kapor, aj šťuka, šťuka má zuby, zuby má aj pes, pes to je aj suka, suka veľa sexuje, do čerta, veď on mi povedal, že som šľapka!”              ', 409, 3.8, 4),
	(1241, 'Zrazia sa dve blondínky oproti sebe v autách. Vystúpia a jedna hovorí druhej:\r\n”No jasné, žena za volantom!”              ', 132, 3.25, 4),
	(1242, 'Blondínka ide autom a zastihne ju snehová búrka. Nespanikári, lebo si spomenie, čo jej hovoril otec:\r\n„Kedykoľvek ťa stretne snehová búrka, počkaj až pôjde okolo pluh a potom choď za ním.“\r\nZanedlho sa naozaj objaví pluh a blondínka ho podľa rady nasleduje. Ide za ním trištvrte hodinu až pluhár vystúpi a pýta sa jej, čo to robí. Ona mu vysvetlí, čo jej otec poradil. Pluhár na to hovorí:\r\n„No, s parkoviskom pred Tescom som už hotový, takže ak chcete, môžete ísť za mnou ku Kauflandu.“               ', 546, 2.67, 4),
	(1243, 'Dve blondínky sa rozprávajú:\r\n”Tak čo, spravila si vodičák?”\r\n”Ale nie, vyhodili ma.”\r\n”Prečo?”\r\n”Tak som si jazdila, až sme sa dostali do kruhového objazdu a tam bola tabuľa 30. Tak som to 30 krát obišla a predsa ma vyhodili.”\r\n”A neprepočítala si sa?”              ', 301, 3.29, 4),
	(1244, 'Blondínka je na prechádzke so psom a zastaví ju policajt:\r\n”Kde máte košík?”\r\nA blondína:\r\n”Však ja nejdem do obchodu!”\r\nA policajt:\r\n”Aha, tak pardón...”              ', 189, 3.86, 4),
	(1245, 'Bola hustá hmla, blondínka pre istotu sledovala koncové svetlá auta, ktoré išlo pred ňou. To však zrazu zastavilo a blondínka nestihla zabrzdiť. Ozval sa buchot, rachot, blondínka vybehla von:\r\n- Prečo ste, prosím vás, tak prudko zastavili? - vyčíta vodičovi.\r\n- Preto, lebo som vošiel do svojej garáže!\n', 324, 3.6, 4),
	(1246, 'Kedy požiadate blondínku o ruku?\r\n- Keď už nevládze ústami.              ', 79, 3.82, 4),
	(1247, 'Čo robí blondínka, keď má menzes?\r\n- Obzerá sa okolo, aby zistila, kto ju postrelil.              ', 104, 3.17, 4),
	(1248, 'Blondínka sa zamyslí.              ', 37, 3.77, 4),
	(1249, '- Viete, čo je to blondínka na vysokej škole?\r\n- Návšteva.              ', 77, 3.2, 4),
	(1250, '- Prečo nechce blondínka robiť pri počítačoch?\r\n- Pretože sa bojí myši!              ', 94, 3.17, 4),
	(1251, '- Ako sa povie, keď jedna blondínka fúkne druhej do ucha?\r\n- Prenos dát.\n', 77, 3.5, 4),
	(1252, '- Počuli ste o tej blondínke, ktorá stála pred zrkadlom so zavretými očami?\r\n- Chcela vidieť, ako vyzerá, keď spí.              ', 138, 3.33, 4),
	(1253, '- Ako zamestnáte blondínku na celý deň?\r\n- Zavediete ju do guľatej miestnosti a poviete jej, aby si sadla do rohu.              ', 133, 3.75, 4),
	(1254, '- Prečo chodia blondínky v sprche stále dokola?\r\n- Pretože si kúpili Wash\'n\'Go.              ', 98, 3.38, 4),
	(1255, '- Čo sa deje, keď si blondína nesie pod pazuchou stoh slamy?\r\n- Nesie si externú pamäť.              ', 107, 2.5, 4),
	(1256, '- Ako zistíte, že fax poslala blondínka? \r\n- Je na ňom poštová známka.               ', 92, 3.5, 4),
	(1257, '- Vieš čo ti odpovie blondínka, keď jej povieš, že má v hlave vákuum?\r\n- Lepšie ako nič.              ', 112, 3, 4),
	(1258, '- Prečo blondínka nevarí polievky z vrecúška?\r\n- Ešte neprišla na to, ako doň dostať pol litra vody!              ', 123, 3.88, 4),
	(1259, '- Máme aj kaviár, želáte si? - pýta sa čašník blondínky.\r\n- Čo je to kaviár?\r\n- To sú vajíčka z jesetera.\r\n- Tak si prosím dve namäkko!\n', 152, 4, 4),
	(1260, 'Dve blondínky idú nakupovať do Tesca a 10 metrov pred vchodom:\r\n- začalo pršať, alebo nie?\r\n- počkaj zistíme to, zastavme sa...\r\n(obe vystreli dlane)\r\n- no zdá sa že prší\r\n- aj na teba??!!              ', 214, 3.4, 4),
	(1261, 'Blondínka na ulici : - Pane, prosím Vás, koľko je hodín?\r\n- Pol štvrtej, odpovedá okoloidúci pán. \r\nBlondínka krúti hlavou a hovorí:\r\n- Viete, to je zvláštne. Pýtam sa na to už celý deň a každý mi hovorí vždy niečo iné.              ', 257, 3.88, 4),
	(1262, 'Viete, prečo blondínky pravidelne polievajú počítač?\r\nLebo chcú surfovať po internete!              ', 108, 3, 4),
	(1263, 'U blondínky začalo horieť, tak sa rozhodla zavolať 155-ku. Zavolá a celá rozrušená a plačúca hovorí: \r\n"Musíte prísť a pomôcť mi, môj dom horí!" \r\nPožiarnik hovorí: \r\n"Dobre, pani, ukľudnite sa. Ako sa tam dostaneme?" \r\nBlondínka: \r\n"Pss, veľký červený náklaďák."              ', 306, 3.17, 4),
	(1264, 'Ako si blondína zlomila nohu pri hrabaní lístia?\r\nSpadla zo stromu.\n', 71, 3.25, 4),
	(1265, 'Blondínka letí do Londýna. Ako ju pripravíte o miesto pri okne?\r\nPoviete jej, že sedadlá do Londýna sú v prostrednej rade.              ', 144, 3.5, 4),
	(1266, 'Je to hnedé, červené, čierne a modré. Čo je to?\r\nBrunetka, ktorá pred blondínkou povedala príliš veľa vtipov o blondínkach.              ', 149, 3.67, 4),
	(1267, 'Viete prečo je blondína šťastná, keď poskladá skladačku za 1 rok?\r\nLebo na krabičke je napísané OD 3 DO 5 ROKOV.              ', 137, 3.44, 4),
	(1268, 'Príde blondínka do rakúskeho supermarketu a hovorí:\r\n- Prosím si dve tužkové baterky. \r\nPredavačka nechápavo odpovedá: \r\n- Wie bitte? \r\nNo a blondínka na to: \r\n- Čo vybité, nabité ty krava!!!              ', 219, 3.6, 4),
	(1269, 'Blondínka stojí na autobusovej zastávke a prihovára sa jej okoloidúci pán: "Slečna, ale tento autobus chodí len cez sviatky." "Aké šťastie, že ja mám dnes narodeniny."\n', 181, 3.4, 4),
	(1270, 'Príde blondínka k doktorovi a ten vidí,že má spálené líce.Tak sa spýta: \r\n- Čo sa vám stalo? \r\n- Keď som žehlila zazvonil telefón, a tak som zdvihla. Potom sa blondínka otočí a doktor vidí, že má spálené aj druhé líce. A tak sa spýta, čo sa jej stalo:\r\n- Neváhala som a rýchlo som volala doktora.              ', 338, 4, 4),
	(1271, 'Volá jedna blondína druhej blondíne a vraví: \r\n- Počuj, zostala mi teplá voda, čo s ňou mám robiť?\r\n- No, daj ju do mrazničky, teplá voda sa vždy zíde.              ', 179, 3.57, 4),
	(1272, 'Viete ako zabije blondýnka holuba?\r\nZhodí ho z okna.              ', 68, 3.7, 4),
	(1273, 'Blondínka prejde križovatku na červenú. Zastaví ju policajt.\r\n- Napravím to, pán policajt, - núka sa, - na ďalšej križovatke zastavím na zelenú.              ', 171, 3, 4),
	(1274, 'Na svetelne riadenej križovatke zastavil automobil, ktorý riadi nádherná dlhonohá blondína. Signály sa menia: zelená, oranžová, červená,  zelená, oranžová, červená … Automobil sa však nehýbe. Dopravný policajt pristúpi k vodičke a pýta sa:\r\n- Slečna, želáte si nejakú inu farbu?              ', 321, 4, 4),
	(1275, 'Príde blondínka do knižnice, oprie sa o pult kde je pani knihovníčka a spustí:\r\n"Jeden cheesburger, jahodový shake, malú kolu ...."\r\n"Ale tu ste v knižnici, slečna." - upozorní ju knihovníčka.\r\n"Aha." - povie blondínka a ďalej pokračuje šeptom:\r\n"Takže jeden cheesburger, jahodový shake, kolu...."              ', 330, 3.5, 4),
	(1276, 'Píše blondínka v nemocnici list:\r\n"Milý darca, ďakujem Ti za Tvoje srdce. Dúfam, že sa čoskoro uzdravíš, ako ja..."              ', 139, 2.83, 4),
	(1277, 'Blondínka ide na aute a narazí do stromu. Vystúpi z auta a hovorí:\r\n- Prepáč, trúbila som.\n', 98, 3.81, 4),
	(1278, 'Ako zistíš, že pri počítači sedela blondínka?\r\nJednoducho. Pri myške je syr.              ', 98, 3.53, 4),
	(1279, 'Čo znamená, keď chodí blondínka po kolenačky v obchode?\r\nHľadá nízke ceny.              ', 97, 3.63, 4),
	(1280, 'Viete prečo blondínky tancujú pod semaforom? \r\nMyslia si že sú na diskotéke.\n', 83, 2.8, 4),
	(1281, 'Ako blondýnka zabije kapra?\r\nUtopí ho.\n', 41, 3.67, 4),
	(1282, 'Blondýnka letí do Londýna. Ako ju pripravíte o miesto pri okne?\r\nPovedzte jej, že sedadla do Londýna sú v prostrednom rade.\n', 131, 3.67, 4),
	(1283, 'Čo urobíte, keď po vás blondýnka hodí poistku?\r\nZdrháte ako o život, pretože má v ústach granát.\n', 109, 4, 4),
	(1284, 'Ako v sobotu rozosmejete blondýnku?\r\nPoviete jej v stredu vtip.\n', 65, 3.58, 4),
	(1285, 'Prečo blondýnka dala prst na klinec, ktorý zatĺkala kladivom do steny?\r\nPretože ju z toho rámusu bolela hlava.\n', 117, 2.86, 4),
	(1286, 'Ako utopíte blondýnku?\r\nDáte na dno bazénu zrkadlo.\n', 56, 2.6, 4),
	(1287, 'Čo je najťažších šesť rokov v živote blondýnky?\r\nSiedma trieda.\n', 73, 3.37, 4),
	(1288, 'Ako zamestnáte blondýnku?\r\nNapíšte na dve strany papiera "Prosím, otoč."\n', 79, 3, 4),
	(1289, 'Koľko blondýnok je treba k hre na schovávačku?\r\nJedna.\n', 59, 3.33, 4),
	(1290, 'Ako skúšala blondýnka zabiť kanárika?\r\nHodila ho z útesu.\n', 64, 2.83, 4),
	(1291, 'Ako zistíte, že s počítačom pracovala blondýnka?\r\nNa monitore je bielitko.\r\nAko zistíte, že s tým počítačom pracovala iná blondýnka?\r\nCez belobu je niečo napísané.\n', 181, 2.8, 4),
	(1292, 'Aký je rozdiel medzi blondýnkou a počítačom?\r\nDo počítača musíte informácie vložiť len raz.\n', 104, 3.5, 4),
	(1293, 'Ako zistíte, že ste dostali fax od blondýnky?\r\nTo je ten so známkou.\n', 73, 2.8, 4),
	(1294, 'Prečo menia blondýnky svojim deťom suché plienky len raz za mesiac?\r\nPretože je na nich napísané "až do šesť kilo".\n', 126, 3.6, 4),
	(1295, 'Prečo nemôžu blondýnky piecť dvojité torty podľa receptu?\r\nTrúba sa nedá rozpáliť na 600 stupňov.\n', 110, 3.25, 4),
	(1296, 'Prečo blondýnky nie sú dobré lekárničky?\r\nPretože sa im nedarí nacpať fľaštičky do písacieho stroja.\n', 114, 2.83, 4),
	(1297, 'Prečo blondýnky nejedia banány?\r\nPretože nemôžu nájsť zips.\n', 68, 3.29, 4),
	(1298, 'Ako nazvete blondýnku, ktorá si odfarbí vlasy nahnedo?\r\nUmelá inteligencia.\n', 80, 3.54, 4),
	(1299, 'Ako zmätiete blondýnku?\r\nDáte jej roztriediť podľa abecedy sáčok M&Ms.\r\nA ako to funguje?\r\n"Patrí 3 pred E, medzi M a W alebo až na koniec?"\n', 150, 2.86, 4),
	(1300, 'Blondínka išla autom a počúvala rádio. Hlásateľ hovoril samé\r\nvtipy o blondínkach, až ju to vytočilo a rádio vypla. O chvíľku\r\nišla okolo kukuričného poľa. \r\nVidí blondínku, ako tam vesluje v člne. Kričí:\r\n"Ty slepica! Presne také ako ty spôsobujú, že sa nám ľudia smejú. Keby som vedela plávať, tak by som ti ukázala!"\n', 353, 4.17, 4),
	(1301, 'Viete prečo blondínka umrela od hladu v letnom kine?\r\nChcela vidieť film "Cez zimu zatvorené!"              ', 112, 3.6, 4),
	(1302, 'Na skúškach v autoškole sa pýtaju blondínky: \r\n"Popíšte ako pracuje motor." \r\n"Možem vlastnými slovami?" \r\n"Nech sa páči!"\r\n"Brrrrrrm, brrrrrrrm, brm brm."              ', 180, 4.14, 4),
	(1303, 'Blondínka u veterinára: \r\n- Pán doktor, ten môj psík nežerie a nežerie...\r\n- Ani žrať nebude a nebude, lebo je drevený.               ', 144, 3.2, 4),
	(1304, 'Viete prečo blondínka otvára mlieko už v obchode?\r\nLebo je na ňom napísané tu otvoriť.              ', 108, 3.56, 4),
	(1305, 'Pýta sa blondínka policajta: \r\n-Prosimvás, kde je druhá strana ulice?\r\nPolicajt jej ju ukáže a blondínka na to:\r\n-Zaujímavé. Tam mi povedali, že je tu.              ', 175, 3.33, 4),
	(1306, 'Viete, čo robí blondína keď má ucho priložené k dverám?\r\nPočúva The Doors.\n', 85, 3.57, 4),
	(1307, 'Čo to znamená, keď  leží  blondína na kolajniciach?\r\nPočuva Metal.\r\nA čo to znamená, keď po tých kolajniciach prejde vlak?\r\nPočúva Death Metal.\n', 157, 4.14, 4),
	(1308, 'Blondínka na pošte:\r\nPočula som, že zdraželo poštovné.\r\nKoľko teraz stojí päťkorunová známka?              ', 120, 2.67, 4),
	(1309, 'Blondínka stojí pred zrkadlom a ako sa tak na seba pozerá nájde si na hlave jeden čierny vlas.\r\nHovorí: "no konečne nejaká nádej".              ', 153, 2.71, 4),
	(1310, 'Blondínka sedí v lietadle pri okne a vraví:\r\n“Aké je to úžasné, ľudia odtiaľto vyzerajú ako mravce!“\r\nMuž sediaci vedľa vraví:\r\n“To sú skutočne mravce, lietadlo ešte nevzlietlo.“\n', 203, 3.58, 4),
	(1311, 'Záznam zo svetovej súťaže inteligentých blondíniek:\r\n- V matematickom teste s prehľadom zvíťazil generátor náhodných čísel...              ', 153, 3.96, 4),
	(1312, 'Blondínka v autoškole:\r\n- Včera som prešla inštruktorovi cez rozum.\r\n- Ako?\r\n- Zadným kolesom.              ', 114, 3.43, 4),
	(1313, 'Blondínka a bruneta kráčajú po púšti, keď sa pri nich zjaví lev. Bruneta duchaprítomne hodí levovi do očí za hrsť piesku a kričí na blondínu:\r\n- Rýchlo utekaj!\r\nA blondínka s kľudom odpovie:\r\n- Ja som piesok nehádzala...              ', 254, 3.95, 4),
	(1314, 'Príde blondínka do sexshopu a pýta si robertka. Predavač jej ukazuje:\r\n- Tento je za 25 dolárov, tento za 35.\r\n- A čo ten veľký pruhovaný?\r\n- Ten je za 125 dolárov.\r\n- Hm, tak mi ho dajte.\r\nPo chvíli príde šéf a pýta sa ako idú kšefty.\r\n- Ale, dobre, práve som predal svoju termosku za 125 dolárov.              ', 331, 3.57, 4),
	(1315, 'Rozprávajú sa dve blondínky:\r\n- Čítala si Shakespeara?\r\nDruhá sa zamyslí:\r\n- A kto to napísal?              ', 116, 3, 4),
	(1316, 'Jedna blondínka sa pýta druhej:\r\n- Kam mám dať tú teplú vodu?\r\n- Do chladničky. Teplá voda sa vždy zíde.              ', 128, 4.14, 4),
	(1317, 'Rozprávajú sa dve blondínky:\r\n- Včera som bola na tehotenskom teste.\r\n- A boli ťažké otázky?              ', 114, 3.37, 4),
	(1318, 'Blondínka a brunetka vypadnú z lietadla. Ktorá dopadne prvá?\r\n- Brunetka, pretože blondína sa musí opýtať na cestu.              ', 138, 3.6, 4),
	(1319, 'Akú chronickú poruchu reči majú blondínky?\r\n- Nevedia povedať “nie”.              ', 92, 3.5, 4),
	(1320, 'Otázka: Prečo blondínka vysadila dvere na kúpeľni?\r\nOdpoveď: Aby ju nešpehovali cez kľúčovú dierku.\n', 111, 3.68, 4),
	(1321, 'Blondínka je v pizzérii. Príde k nej čašník a pýta sa :,,Na kolko častí chcete rozdeliť pizzu? Na osem alebo na štyri?´´a blondínka na to:,,Ježiš na štyri veď osem by som nezjedla´´              ', 215, 3.84, 4),
	(1322, 'Blondínka, brunetka a ryšavá by chceli dostať prácu ako natieračky stredových cestných pruhov. Šéf sa preto rozhodol, že dá šancu každej. Budú natierať tri dni a tá, ktorá ich natrie najviac, dostane miesto. Na konci prvého dňa ryšavá natrela 3 kilometre, bruneta 2,5 kilometra a blondína 10 kilometrov. Šéf bol skutočne prekvapený, povedal jej: \r\n„Ak si takéto tempo udržíš, miesto je tvoje." \r\nNa ďalší deň ryšavá natrela 5 kilometrov, bruneta 5,5 kilometra a blondína len 4 kilometre. \r\nŠéf jej vraví: \r\n„Nevadí, stále máš náskok." \r\nNa tretí deň ryšavá natrela 6 kilometrov, bruneta 5 kilometrov a blondína len kilometer. \r\nŠéf bol veľmi sklamaný a vraví blondíne: \r\n„Čo sa stalo, veď sa ti tak darilo?" \r\n„Nuž, to vedro s farbou je stále ďalej a ďalej..."              ', 845, 4.03, 4),
	(1323, 'V aute šli blondínka, bruneta a ryšavá. Ako tak šli, nezastavili na stopke a policajt ich začal naháňať. Kedže získali pred policajtom náskok a v priekope videli tri vrecia, zastavali a každá z nich sa skryla do vreca. Keď ich policajt dohnal, videl prázdne auto a tri vrecia. Najprv prišiel k vrecu brunety a kopol do neho. Z vreca vyšlo: \r\n"Mjau, mjau." \r\n"Tam musí byť mačička." hovorí si policajt. Príde k vrecu ryšavej a kopne. \r\n"Haf, haf." počuť z vreca. \r\n"Oh, tam musí byť šteniatko," hovorí policajt. Nakoniec príde k vrecu blondíny, kopne a z vreca počuť: \r\n"Zemiak."              ', 627, 3.75, 4),
	(1325, 'Blondínka prišla do zapadnutého obchodíka v Louisiane a zapáčili sa jej krokodílie topánky. Keď jej však obchodník povie cenu, snaží sa znižovať. Obchodník sa však nedá a hovorí:\r\n- Pozrite, toto sú pravé krokodílie topánky a ich cenu nemôžem znížiť, keď ich tak veľmi chcete, zaobstarajte si ich sama.\r\nO dva dni prechádzal obchodník popri rybníku a vidí blondínku ako stojí po kolená vo vode s flintou v ruke. Na brehu sa váľa už dvanásť krokodílov, po chvíli vytiahne ďalšieho a nešťastne volá:\r\n- Dokelu, ani tento nemá topánky!              ', 597, 3.73, 4),
	(1326, 'Tri blondínky ostali samé na pustom ostrove. Nevedia, čo si počať, a tak tam len sedia a sedia. Vtom sa objaví víla a hovorí, že každej splní jedno želanie. Prvá blondínka hovorí, že by chcela byť múdrejšia, aby sa odtiaľ dostala. Razom jej stmavnú vlasy, je z nej brunetka a tá neváha, vrhne sa do vody a z ostrova odpláva. Druhá blondínka si praje byť múdrejšia ako tá prvá. Stane sa z nej čiernovláska. Nájde na ostrove pár mušlí, s ich pomocou nareže rákosie a vyrobí si čln, na ktorom odpláva. No a tretia blondínka si želá byť ešte múdrejšia. Splní sa, zrazu sa z nej stane muž a odíde po moste.              ', 667, 4, 4),
	(1327, 'Blondínka a bruneta sedia v bare a pozerajú správy o šiestej. Ukazovali reportáž o samovrahovi, ktorý stál na moste a vyhrážal sa, že skočí dole. Blondínka hovorí:\r\n- Stav sa, že neskočí.\r\n- Dobre, o kilo. Ja si myslím, že skočí.\r\nNo a chlapík skočil. Blondínka vysolí kilo a bruneta hovorí:\r\n- Nie, to nejde, ja si to nezoberiem. Si predsa moja kamarátka.\r\n- Ber, stávka je stávka.\r\n- Pozri, - vraví bruneta - musím sa ti priznať, že som to už videla v správach o piatej, takže si tie peniaze nemôžem vziať.\r\nBlondína nato:\r\n- Ja som to tiež videla o piatej, ale nikdy by ma nenapadlo, že skočí znova.              ', 661, 4.29, 4),
	(1328, 'Viete koľko blondínok pripravuje čokoládovú tortu?\r\nTri. Dve lúpu lentilky a jedna robí cesto.              ', 115, 3.83, 4),
