	(1332, 'Príde blondínka do obchodu a pýta sa predavača:- Predáte mi televízor?\r\nA predavač na to:- Prepáčte, ale Blondínkam nepredávame.\r\nNa druhý deň príde zasa blondínka, ale zamaskovaná a pýta sa predavača: - Predáte mi tamten televízor?\r\nA predavač odpovie: - Prepáčte, ale blondínkam nepredávame.\r\n- A ako viete, že som blondínka?\r\n- Pretože to nie je televízor, ale mikrovlnka.', 404, 3.19, 4),
