	(1335, '3 blondínky na opustenom ostrove chytia zlatú rybku:\r\n-Ak ma necháte žiť, splním každej jedno želanie.\r\nPrvá blondínka:\r\n-Chcem byť inteligentná.\r\nBlondínka sa stala inteligentnou a preplávala na pevninu.\r\nDruhá blondínka:\r\n-Chcem byť ešte inteligentnejšia.\r\nBlondínka sa stala ešte inteligentnejšou ako tá prvá, postavila si loď a odplávala z ostrova.\r\nTretia blondínka:\r\n-Chcem byť najinteligentnejšia.\r\nA blondínka sa zmenila na muža a odišla z ostrova po moste. \r\n', 500, 3.11, 4),
	(1336, 'Blondínka, brunetka a ryšavo-vláska idú vyskúšať detektor lži. (Keď detektor zapíska znamená to že niekto klame).\r\n- Prvá ide ryšavo-vláska a hovorí myslím si, že som pekná a mám dobrú postavu PÍÍÍP\r\n- Ide brunetka a hovorí: myslím si, že mám krásne dlhé vlasy PÍÍP.\r\n- Ide blondínka a hovorí: myslím si ... PÍÍP.', 350, 3.33, 4),
