	(1342, 'Ide blondínka v múzeu a zvedavo sa pozerá okolo seba, až narazí do stolíka s vázou. Váza sa zakýve, spadne na zem a hneď je na kusy. V okamihu je na mieste strážnik, ktorý začne nadávať:\r\n-Ženská nešťastná! Čo ste to urobila?Tá váza je z 18.storočia!\r\nBlondína sa chytí za srdce a vzdychne si:\r\n-Uf,ja som sa už bála, že bola nová!', 362, 3.56, 4),
