	(1348, 'Ide blondínka autom po ceste a zrazu zastaví na semafóre. Práve na ňom svieti červená. "Jéj, tá farba je ale krásna!" hovorí. Naskočí oranžová a hovorí: "A tá je ešte krajšia!" Naskočí zelená a hovorí: "A tá je hádam najkrajšia!!!" Blodínke strašne žiarili oči a od údivu sa dobre že nezbláznila. No naskočila zasa oranžová a červená a vraví: "Jój, tu som už videla. Ideme!"\r\n\n', 418, 3.63, 4),
