	(1356, 'Príde zúfalá blondínka po natankovaní za pumpárom a prosí o pomoc.\r\n- Pán pumpár, zabuchla som si v aute kľúče. Nemohli by ste mi s tým\r\nnejako pomôcť?\r\n- Dám vám háčik a s tým si to auto otvoríte.\r\n- A nemohli by ste mi to ísť otvoriť vy?\r\n- Bohužiaľ, ale musím ostať za kasou.\r\nNa to blondínka išla ku svojmu autu. Vtom vošiel na pumpu pán, ktorý sa strašne smial. Pumpár sa ho pýta:\r\n- Čo sa stalo?\r\n- Ale, to ste ešte nevideli. Vonku je blondínka a snaží sa otvoriť auto háčikom.\r\n- No a čo, však to som jej poradil ja.\r\n- No ale vnútri v aute sedí druha blondínka, ktorá jej radí: doprava, ešte kúsok, nie teraz doľava...', 680, 3.65, 4),
