	(1391, 'Mlada princezná sa chystá na bál. Pozrie do zrkadla a vidí, že na hlave má len 3 vlasy. Rozhodne sa, že si ich zapletie. Zapletá, zapletá, keď jej jeden vlas vypadne, ostanú jej dva vlasy. Princezná si povzdychne a zapletá ďalej už len z dvoch vlasov. Ako tak zapletá, vypadne jej ďalší vlas. Princezná si vzdychne a povie: "No nič, nechám si ich radšej rozpustené."', 390, 3.75, 4),
