	(1494, 'Pýta sa jedna blondínka druhej: "Urobila si ten vodičák?"\r\n"Nie, vyhodili ma..."\r\n  "A prečo?"\r\n  "Išla som ku kruhovému objazdu, tam bola ceduľa 30, tak som to 30-krát obišla a aj napriek tomu ma vyhodili!"\r\n"A nepomýlila si sa pri tom počítaní?"', 261, 3, 4),
	(1495, 'Trpaslík chce nastúpiť do autobusu,\r\nkeď ho vtom predbehne blondínka.\r\n"Kam sa pcháš ty drzá bruneta?"\r\n" Ale já som blondína!" - bráni sa slečna.\r\n"No ale ja to odtiaľto vidím inak!"', 197, 3.67, 4),
