	(1497, 'Z auta vystúpi nasraný chlap a kričí na ženu za volantom druhého auta:\r\n- Ty krava, robili sa ty vôbec niekedy vodičák?!\r\nA blondínka mu odpovie: - Určite viackrát ako ty, debil...!', 193, 3.41, 4),
