	(1510, 'Blondínka s brunetkou cestujú vlakom.\r\nOproti ním si sadne jeden starší prešedivelý, bradatý muž. Blondýnka sa obráti k brunetke:\r\n- Ty počuj, nie je to kráľ Štefan?\r\nBrunetka jej na to:\r\nŠibe ti, veď ten zomrel pred vyše 100 rokmi..\r\nO nejaký čas vojde do kupé další muž a vraví:\r\nNazdar Štefan! Ako sa máš? Už 100 rokov som ťa nevidel...\r\nNa to blondínka:\r\nNo... a komu tu teraz šibe?', 418, 4.15, 4),
	(1511, 'Súťaž v plávaní:\r\nAko prvé idú plávať blondínka, brunetka a ryšavka. Plávať majú vo vode s teplotou -5 stupňov C, štýlom prsia.Prvá dopláva brunetka, potom ryšavka a po 5 hodinách blondínka. Tá vybehne z vody zamrznutá a kričí: "Tie dve používali ruky."', 281, 3.79, 4),
