	(1514, 'Blondínka si v lietadle sadne k oknu. Za chvíľku k nej príde fešný chlapík a hovorí: - Prepáčte slečna, ale toto sedadlo je moje...Blondínka:- Daj si odchod mladý, také blbé finty poznám... Neotravuj! Chlapík pokrčí ramenami a hovorí:- Tak si to lietadlo pilotuj sama, ty krava! ', 299, 3.88, 4),
