	(1516, 'Blondínka si robí vodičský preukaz. Nasadne do auta a hovorí: "Aha volant! To je na to, aby som mohla vytočiť do zákruty."Ďalej hovorí: "Aha dierka na kľúč! To je na to, aby som mohla naštartovať auto."A nakoniec dodá: "Upss, je tu problém! Tri pedále a ja mám len dve nohy."', 294, 3.31, 4),
	(1517, 'Si blondínka.\r\n\n   Cestuješ autobusom.\r\n\n   Súrne si potrebuješ prdnúť.\r\n\n   Našťastie hrá hlasná hudba a tak si pár krát uľavíš, samozrejme úplne petfektne v rytme duniacich bicích.\r\n\nKeď odchádzaš z autobusu, všimneš si, že ostatní cestujúci na tebe pohoršene a znechutene pozerajú.\r\n\nZrazu si uvedomíš že si celý čas mala na ušiach empétrojku. ', 381, 4.24, 4),
