	(1519, 'Policajti potrebovali ženu - policajtku, ktorá bude vyšetrovateľka. Urobili teda konkurz. Čakali dlho do noci, no prišli iba tri blondínky.\r\nTak zavolali prvú. Policajt otvorí knihu zločincov, nalistuje nejakú stranu a pýta sa: "Slečna, čo by ste povedali o tomto zločincovi?"\r\nBlondínka sa zamyslí a odpovedá:"Podľa mňa má len jedno ucho." A policajt na to: "To je fotka z profilu. Vypadnite!"\r\nTak príde druhá. Policajt jej opäť ukáže tú istú fotografiu a pýta sa:"Slečna. Čo by ste povedali o tomto zločincovi?"\r\n"Hmm. Má len jedno oko."\r\nNahnevaný policajt na ňu kričí:"To je fotka z profilu.Vypadnite!"\r\nTretej blondínke jej kamarátky povedali, že ten zločinec má len jedno ucho a jedno oko.\r\nBlondínka vojde dnu a policajt sa jej pýta:"Tak slečna. Povedzte mi, čo si myslíte o tomto zločincovi?\r\n"Podľa mňa nosí kontaktné šošovky." Prekvapený policajt číta zápisnicu o tom zločincovi a dočíta sa, že naozaj má kontaktné šošovky. A tak sa opýta:"Ako ste vedeli, že nosí kontaktné šošovky?" "Ále to je jednoduché. Ako by si dal okuliare, keď má len jedno oko a jedno ucho?"', 1154, 3.81, 4),
