	(1618, 'Muž si zabudne doma mobil a manželka blondínka mu píše: Drahý, zabudol si si doma mobil.', 94, 3.41, 4),
	(1619, '- Idú 4 blondínky pod jedným dáždnikom a všetky sú suché. Ako je to možné?\r\n- Neprší.', 97, 3.79, 4),
	(1620, 'Išli tri blondínky lietadlom a mali so sebou granát, stoličku a klavír.\r\nPrvá blondínka vyhodí z okna stoličku.\r\nPotom vystúpi z lietadla a pýta sa starenky: "Starenka, prečo plačete?"\r\n"Stolička mi zabila muža."\r\nDruhá blondínka vyhodí z okna klavír.\r\nPotom vystúpi z lietadla a pýta sa starenky: "Starenka, prečo plačete?"\r\n"Klavír mi zabil muža."\r\nTretia blondínka vyhodí z okna granát.\r\nPotom vystúpi z lietadla a pýta sa starenky: "Starenka, prečo sa tak strašne smejete?"\r\n"Ale, môj muž si tak strašne prdol, že to za ním vybuchlo."', 575, 3.75, 4),
	(1621, 'Leží blondínka na posteli s vibrátorom a hovorí mu: "Netrias sa, aj ja to robím po prvýkrát."', 101, 3.77, 4),
	(1622, 'Prečo, keď sa blondínka oprie o múr, ten spadne?\rLebo múdrejší ustúpi.', 78, 4.09, 4),
	(1623, 'Blondínka v autoškole sadne do auta a spustí:\r\nTak toto je bezpečnostný pás, treba sa ním pripútať. \r\nÁáá, prevodová páka, rozumiem, na riadenie rýchlosti. \r\nÁáá, volant, rozumiem, bez neho by sme nemohli ísť do zákruty. \r\nÁáá, kľúčik v spínači, rozumiem, s ním naštartujem motor.\r\nZrazu jej skĺzne zrak na podlahu. Chvíľu je ticho a potom povie:\r\nA máme problém. Tu sú tri pedále a ja mám iba dve nohy!', 442, 4.09, 4),
	(1624, 'Blondínka sa chce naučiť jazdiť na koni. Príde do jazdiarne. Tam jej inštruktor vysvetľuje, ako sa treba starať o koňa... Keď už je so všetkým oboznámená, povie jej, nech si pripraví koňa na jazdu, že on ju zatiaľ počká pred stajňou. Čaká 5 minút, čaká 10; a blondínka s koňom stále nevychádza. Tak sa ide pozrieť, čo sa deje. Tu nájde blondínku ako fajčí koňovi:\r\n- "Preboha, to čo robíš?!"\r\n- "Však ste predsa povedali, aby som pripravila koňa na jazdenie! Ja toto robím vždy predtým, ako vysadnem na chlapa."', 557, 4.12, 4),
	(1625, 'Blondínka si kupuje nové auto a pýta sa predajcu:\r\n- Prosím vás, je to rýchle auto?\r\n- Samozrejme, 240 km za hodinu…\r\n- Nekecajte, veď hodina toľko kilometrov ani nemá… !', 183, 3.86, 4),
	(1626, 'Blondínka ide do skúšobnej kabínky. O 5 minút kričí: "Kde je toaletný papier?"', 86, 3.98, 4),
	(1627, 'Viete prečo blondínka stojí pod semafórom?\r\nLebo si myslí, že tam je diskotéka.', 86, 3.25, 4),
	(1628, 'Viete prečo blondínka plače, keď porodí dvojičky?\r\nLebo nevie koho je to druhé.', 86, 3.34, 4),
	(1629, 'Viete ako zabiť blondínku?\r\nPôjdete s ňou na vrch mrakodrapu a poviete jej "skoč na nákupy". ', 99, 3.71, 4),
	(1630, 'Viete prečo blondínka dáva čižmy do klietky?\r\nAby jej neutiekla puma.', 74, 3.27, 4),
	(1631, 'Ide blondína po dialnici a z rádia počuje: \r\n"Pozor všetkým na dialnici! Na päťdesiatom kilometri ide nejaký šialenec v protismere!" \r\nBlondína sa pozrie z okna a zhrozí sa: \r\n"Že jeden, veď tu je šialencov plná diaľnica!"', 238, 3.75, 4),
	(1632, 'Viete aký je rozdiel medzi múdrou blondínkou a Yetim?\r\nYetiho už vraj videli.', 81, 3.43, 4),
	(1633, 'Viete ako zabavíte blondínku?\r\nZavriete ju do okrúhlej miestnosti a povedzte jej, nech nájde roh.', 101, 3.57, 4),
	(1634, 'Dve blondínky hrajú šach a prvá hovorí:\r\nGóóól. \r\nA druhá na to: \r\nVeď to nie je tenis, ty krava.', 107, 3.94, 4),
	(1635, 'Viete ako spoznáte, že blondínka bola na počítači?\r\nNa monitore je bielitko.', 82, 3.04, 4),
	(1636, 'Ide blondínka v aute, narazí do stromu, vystúpi z auta, objíme stromček a pritom mu hovorí: Stromček, stromček, prepáč, ale ja som trúbila...', 152, 3.61, 4),
	(1637, 'Vstúpi blondínka do autobusu,  v ušiach má MP3 a strašne sa jej chce prdnúť. Blondínka si povie: „Ale keď tu hrá tak silno hudba, tak by som si mohla prdnúť, však to nikto nebude počuť.“', 205, 3.92, 4),
	(1638, 'Muž hovorí blondínke:\r\nVieš, že na Marse objavili také malé živočíchy, že ich voľným okom nevidíš?!\r\nBlondínka na to:\r\nAle ty voľné oko nemáš.', 162, 4.03, 4),
	(1639, 'Viete prečo blondínky sedia tak dlho na záchode?\r\nLebo čítajú toaletný papier.', 85, 3.59, 4),
	(1640, '- Viete prečo blondínka nevie napísať číslo 11?\r\n- Lebo nevie, ktorá jednotka ma isť prvá.', 99, 3.52, 4),
	(1641, '- Štyri blondínky sa hádajú, ktorá bude sedieť pri okne.', 62, 2.78, 4),
	(1642, 'Viete prečo blondínky vyhadzujú hodinky do vzduchu? \r\nPretože chcú vidieť ako letí čas. ', 96, 3.34, 4),
	(1643, 'Rozprávajú sa dve blondínky: „Počula som, že tento rok bude 1. apríl v piatok.“\r\nA druhá blondínka jej hovorí: „Len dúfam, že to nebude piatok 13-teho.“\r\n', 173, 3.82, 4),
	(1644, 'Viete prečo si blondínka skladá dvere keď sa ide kúpať? \r\nAby na ňu nikto nepozeral cez dierku.', 102, 3.5, 4),
	(1645, 'Rozprávajú sa dve blondínky, jedna spadne do kanála a hovorí:\r\nEšteže mám otvorený poklop, inak by som nič nevidela.', 126, 3.69, 4),
	(1646, 'V mrakodrape na najvyššom poschodí je bar. Príde doň krásna blondínka a pýta sa chlapíka sediaceho pri bare, prečo pije tak veľa piva.\r\nChlapík jej odpovie, že ho pije, pretože je po ňom nesmrteľný.\r\nBlondínka mu neverí, a tak mu kúpi pivo.  Chlapík ho vypije, skočí z okna a... nezabije sa.\r\nBlondínka chce byť tiež nesmrteľná, tak vypije tiež pivo, skočí z okna, a... zabije sa.\r\nBarman sa otočí k chlapíkovi a hovorí mu: „Spiderman, ty si taký CHUJ!!!“\r\n', 497, 3.67, 4),
	(1647, '- Viete prečo blondínka tancuje pri semafore? \r\n- Lebo si myslí, že je tam diskotéka.', 90, 3.41, 4),
	(1648, 'Blondínka sa háda so stenou. Potom sa o ňu oprie a stena za chvíľu spadne. Prečo? Lebo múdrejší ustúpi.  ', 115, 3.24, 4),
	(1649, 'Prečo blondínky nevaria sáčkové polievky?\r\nLebo ešte neprišli na to, ako naliať do sáčka liter vody.', 110, 3.44, 4),
	(1650, 'Prečo menia blondýnky svojim deťom suché plienky len raz za mesiac? \r\nPretože je na nich napísané až do 6 Kg.', 117, 3.37, 4),
	(1651, 'Nápis na mestskom WC u eskimákov: \r\n"Prosíme vás, ak ste sa vyčúrali, nehádžte to na zem, ale oprite to láskavo do kúta".', 131, 3.28, 5),
	(1652, 'Čínania ukradli rusom tajné plány na MIG 29. Neskôr ho začali čínania stavať a keď ho postavili, vyšla im z toho parná lokomotíva. Pod nákresom bolo napísané: "ďalej vypracovať pilníkom".', 206, 3.3, 5),
	(1653, 'Zahraničný novinár príde na návštevu do Uzbekistanu, trafí do bohom zabudnutej horskej dediny, nezaprie svoju profesiu a snaží sa aj z tohto prostredia napísať story.  \r\n- Aký bol váš najčudnejší zážitok? - pýta sa miestneho sedliaka\r\n- No, nedávno sa mi v horách stratila koza. Všetci dedinčania prišli ku mne domov, popili sme vodku, potom sme išli do hôr hľadať kozu. Našli sme ju, vrátili sa domov, všetci sme ju pretiahli, potom sme zas pili vodku.\r\n- Aha...Fuj dosť odporné. A mohli by ste mi povedať, aký bol váš najšťastnejší deň?\r\n- No, nedávno sa v horách stratila žena jedného dedinčana. Všetci sme išli k nemu domov, popili sme vodku, potom sme išli do hôr. Našli sme ju, vrátili sa domov, všetci sme ju pretiahli, potom sme zas pili vodku.\r\n- To je strašné! No dobre, skúsim to ináč... Aký bol váš najstrašnejší zážitok v živote?\r\n- No, jedného dňa som sa stratil v horách...', 960, 3.9, 5),
	(1654, 'Turista ide po Bratislave a pýta sa malého blavana.\r\n- Prosím ťa, ako sa dostanem do múzea?\r\n- Dajte sa vypchať.', 118, 3.73, 5),
	(1655, 'Slovák príde v čechách do baru a hovorí barmanovi:\r\n- Jednu whisky.\r\n- Skotskou?\r\n- Nie, bez kocky.', 104, 3.35, 5),
	(1656, 'Do amerického baru vstoupí tri výrobci piva - Coors, Budweiser a Prazdroj.\r\nTen od Coorsu si objedná Coors protože, jak neopomene zduraznit, je varené z těch nejlepších surovin.\r\nDruhý si porucí Bud Light, protoze to je přece nejlepší na svete.\r\nTen Čech si poručí coca-colu.\r\nSpolečníci se ptají:\r\n"Vy si nedáte pivo? "\r\n"Kdepak, když vy nepijete pivo, ani já nemusím."', 394, 3.56, 5),
	(1657, 'Pýta sa plzeňák plzeňáka:\r\n- Hela pane, vodkunda pa ste ?\r\n- Ja ? Ja som vocaszdejší.', 92, 3.11, 5),
	(1658, 'Američan, Nemec a Rus si rozprávajú v nebi, ako ktorý z nich zomrel. Američan hovorí:\r\n- Ja som si kúpil motorku, previezol som sa na nej, nabúral som a zomrel som.\r\nNemec hovorí:\r\n- Ja som si kúpil lietadlo, letel som príliš nízko, havaroval som a zabil som sa.\r\nRus hovorí: \r\n- To je ešte nič. Môjmu bratovi kúpili bicykel a ja som zomrel od hladu.', 368, 3.77, 5),
	(1659, 'Škót klope u lekára.\r\n"Pán doktor pozrite sa mi na jazyk, zadrela sa mi doň trieska."\r\n"Trieska do jazyka? A to už ako?"\r\n"Viete, glg whisky sa mi vylial na podlahu."', 172, 3.3, 5),
	(1660, 'Viete prečo majú angličania dobrý čaj?\r\nLebo nevedia variť kávu.', 71, 3.56, 5),
	(1661, 'Nemecký turista na salaši. Bača naňho kričí:\r\n- Pozor! Ten pes hryzie!\r\n- Was? Was?\r\nBača na to: \r\n- Čože mňa, ale vás.', 130, 3.03, 5),
	(1662, 'Ide chlap po Prahe a hľadá prádelňu. Zrazu vidí nápis \'Pradelna Hanse Olafsena\'. Vojde dnu a hľadá vysokého blonďáka, ale žiadneho nevidí, za pultom stojí malý čierny šikmooký vietnamec.\r\n- Ty si tu majiteľom?\r\n- Áno.\r\n- A prečo máš také divne meno?\r\n- Na imigračnom úrade stál predo mnou taký vysoký blonďatý švéd menom Hans Olafsen a keď som prišiel na radu ja a opýtali sa ma, ako sa volám, povedal som \'Taky Tak\'.', 454, 3.25, 5),
	(1663, 'Príde slovák do obchodu v Prahe a vraví: \r\n- Dajte mi to lano. \r\n- Co??? \r\n- No, dajte mi to lano! \r\nA ukáže na druhý regál. \r\n- Jo, vy myslíte provaz. \r\n- No jasné, že je pre mňa, ty debo, pre koho by asi bolo!', 222, 3.36, 5),
	(1664, 'Americký turista stojí pred Eifelovou vežou a nadšene si ju prehliada. Potom zastaví okoloidúceho a hovorí:\r\n- Nádherná veža. Koľko barelov nafty z nej denne vyťažia?', 179, 3.39, 5),
	(1665, 'Traja Číňani, Chu, Bu a Fu sa rozhodli emigrovať do Ameriky. Na americkom letisku ich však museli premenovať a tak s Chu bol Chuck s Bu bol Buck a Fu sa musel vrátiť späť do Číny.', 191, 3.57, 5),
	(1666, 'Američan, Rus a Slovák su v lietadle.Američan vyhodí von oknom počítač.A Rus sa ho pýta:\r\n"Čo robíš!"\r\n"My máme toho dosť."\r\nRus zobere vodku a vyšmarí ju von oknom.\r\nA Slovák sa ho pýta:\r\n"Čo robíš!"\r\n"My máme toho dosť."\r\nA Slovák sa naštve a vyšmarí von oknom Cigána. A oni sa ho pýtaju:\r\n"Čo robíš!"\r\n"My máme toho dosť."', 358, 3.5, 5),
	(1667, 'KOSOVO:\r\nPredpoveď počasia:\r\n"Cez deň F15 a F16 , v noci B12."', 65, 3.42, 5),
	(1668, 'Viete, čo je to 13-12-14?\r\nSomálska SEXBOMBA!', 47, 3.18, 5),
	(1669, 'Hecujú sa traja montéri, ktorí sa vrátili z Afriky, ktorý z nich videl černejšiu černošku. Prvý hovorí:\r\n"Ja som stretol takú, ktorá bola taká čierna, že ju v noci nebolo vidieť."\r\nDruhý na to:\r\n"Ja som videl takú, ktorá keď kojila dieťa, tieklo namiesto mlieka kakao!"\r\nTretí hovorí:\r\n"To ja som kamaráti videl takú, ktorá keď si uľavila, lietali sadze!"', 384, 3.64, 5),
	(1670, 'Príde židovský syn za svojím otcom:\r\n"Oci, daj mi 5 korún."\r\n"Čo chces 4 koruny? Na čo Ti budú 3? Čo budeš robiť s dvoma? Tu máš korunu a rozdeľ sa s bratom."', 172, 3.72, 5),
	(1671, 'Angličan sa ubytuje v hoteli na izbe č. 222 a po chvíli dostane chuť na rum. Vytočí číslo na recepciu a objednáva:\r\n"Two rums to room two two two!"\r\nZ recepcie sa ozve:\r\n"Tram tara ra tram ta ta..."', 207, 3.6, 5),
	(1672, 'Obchodný cestujúci zazvoní na dvere. Otvorí mu deväťročný chlapec fajčiaci obrovskú cigaru. Prekvapený obchodník sa pýta:\r\n"Ahoj, máš doma mamičku?"\r\nChlapec silno potiahne, vyfúkne naňho dym, odklepne popol a prehodí: "Hm,... a čo myslíte?"', 262, 3.64, 5),
	(1673, 'Ako sa majú ľudia v Kosove ?\r\nBOMBOVO.', 40, 3.45, 5),
	(1674, '"...zo všetkých indiánskych hercov sa mi najviac páči GOJKO SYTIČ."', 73, 3.13, 5),
	(1675, 'Malý černoško sa pýta svojej mamy belošky:\r\n"Prečo som ja čierny a ty biela?"\r\nMama odpovedá:\r\n"Buď rád, že si černoch a nie pes, taký to bol vtedy žúr..."', 170, 3.31, 5),
	(1676, 'Prečo žijú Škóti tak dlho?\r\nLebo v Škótsku sú drahé pohreby!', 69, 3.35, 5),
	(1677, 'Príde Maďar prvý raz na poštu. Slečna mu ukazuje, ako treba telefonovať.\r\n- Ľavou rukou držíte slúchadlo a pravou vykrúcate číslo!\r\n- Dobre, ale čím potom hovorím?', 179, 3.23, 5),
	(1678, 'Stretnú sa Nemec, Američan a Pražák a hádajú sa, kto má ťažšiu reč. Nemec: "My píšeme nein a čítame najn."\r\nAngličan: "My zasa píšeme New York a čítame ako Ňu Jork."\r\nPražák:"Nemáte na nás, my píšeme Praha 3 a čítame Žižkov."', 256, 3.41, 5),
	(1679, '- Vieš aký je ideál ženskej krásy v Amerike? 90-60-90.\r\n- Však to je aj u nás.\r\n- To áno, lenže oni to majú v palcoch.', 128, 3.21, 5),
	(1680, 'Je to žlté a má to blbý výraz tváre... Čo je to?\r\nVietnamec na daňovom úrade.', 86, 3.21, 5),
	(1681, 'Stretne Jano kamaráta.\r\n- Juro, počul som, že rozprávaš dobre po anglicky.\r\n- Áno.\r\n- Tak čo potom znamená Why?\r\n- Prečo.\r\n- Iba tak sa pýtam.', 152, 3.56, 5),
	(1682, 'Ako vyzerajú inteligentní ľudia v USA? \r\nAko turisti!', 56, 3.68, 5),
	(1683, 'Lietadlo nad atlantikom stráca výšku, motory vynechávajú, kapitán prikáže vyhodiť všetky batožiny. Na chvíľu to pomôže, ale o chvíľu sa morská hladina opäť nebezpečne blíži. Pasažieri po sobe nervózne pokukujú, niekto sa musí obetovať pre záchranu ostatných. Američan vstane, vypije poslednú whisky v bare, pobozká nejprsatejšiu letušku a s výkrikom\r\n"Som Batman! Som Superman!", vyskočí.\r\nKeď sa výška opäť zníži, vstane Francúz, nie je predsa o nič menší hrdina než Američani. Vypije pohár červeneho vína, pobozká na rozlúčku všetky letušky, zvolá:\r\n"Viva la France!", a vyskočí.\r\nZase to na chvíľku pomohlo, ale breh je ešte ďaleko, tak vstane slovák, vypije všetky zbytky v bare, pobozká všetky ženy v lietadle a s výkrikom \r\n"Nech žije Mozambik!", vyhodí von černocha.', 848, 3.96, 5),
	(1684, 'Američan, Francúz a Rus sa bavia o manželkách. \r\nAmeričan hovorí:\r\n"Tá moja je ako kólia, prítulná, poslušná, proste ako kólia."\r\nFrancúz hovorí:\r\nTá moja je ako chrt, vysoká štíhla, energická, proste ako chrt."\r\nA rus si povzdychne:\r\n"Da, da, maja tóže sabaka, no neznaju kakoj sort."', 307, 3.07, 5),
	(1685, 'Dvaja somálci sedia vo vani a jeden hovorí druhému:\r\n- Teraz ma drž, idem vypustiť vodu!', 93, 3.54, 5),
	(1686, 'Ako zistíte, že ste v Škótsku?\r\nNa dvore sa suší toaletný papier.', 72, 3.45, 5),
	(1687, 'Sedí v krčme Angličan, Nemec, Japonec a Slovák a len tak popíjajú. Keď už sú riadne pripití, Japonec sa postaví a napľuje Angličanovi do tváre. Na to sa Angličan postaví a vyzve Japonca, aby s ním išiel von. Z vonku je počut buchot, treskot, keď po chvíli vstúpi dovnútra Japonec a vraví:\r\n- To čo ste počuli, bolo karate od nás z Japonska. \r\nSlovák a Nemec sa na seba pozrú, začudujú sa a popíjajú ďalej. V tom Japonec zase vstane a napľuje Nemcovi do tváre. Nemec sa postaví a už odchádzajú von. Z vonka je počuť buchot, treskot a keď sa Japonec vráti hovorí:\r\n- A toto bolo Aikido od nás z Japonska. \r\nSlovák si z toho nič nerobí, až mu Japonec napľuje do tváre. Tak vstane aj on a obaja odchádzajú von. Vonku zostane ticho a až po dlhej chvíli sa ozve jedna jediná rana a ticho... V tom vstúpi do krčmy Slovák a vraví:\r\n- Pozdravuje Vás Japonec a to čo ste počuli bol hever z mazdy od nich z Japonska.', 969, 3.5, 5),
	(1688, 'Škót príde do kina so svojou manželkou. Tma, ticho... Ona:\r\n- Kúpil si aspoň teraz trochu čokolády?\r\n- Nie, tu máš papier a šušti!', 142, 3.22, 5),
	(1689, 'Na letný kurz slovenského jazyka pricestovali do Bratislavy aj dvaja Japonci. Vyučujúci im na prvej hodine povedali, aby si zohnali nejaké noviny, že sa o článkoch na druhý deň porozprávajú. Na druhý deň sa učiteľ pýta:\r\n- Zohnali ste noviny?\r\n- Áno prosím!\r\n- Rozumeli ste všetkému?\r\n- Nie, nerozumeli sme ničomu!\r\n- A ako sa tie noviny volajú?\r\n- Új Szó!', 381, 3.17, 5),
	(1690, '- Do you speak English? \r\n- Čo?\r\n- Do you speak English?\r\n- Čo?\r\n- Hovoríte po anglicky?\r\n- Yes, yes.', 104, 3.47, 5),
	(1691, 'Na koľkých autách sa sťahujú Somálci?\r\nNa dvoch. V jednom ide prezident.', 78, 3.13, 5),
	(1692, 'Urobia Slovinci svoju prvú atómovú bombu a chcú ju vyskúšať. Rozhodnú sa, že ju zhodia na USA. Tak sa určite dozvú, či bola dobrá, alebo nie. Vystrelia ju, čakajú deň-dva, nič. A tak rýchlo zmontujú druhú, cieľ: Washington. Opäť nič sa nedeje. Zúfalí, že sa im zrejme nepodarila, pošlú poslednú, tretiu opäť na Ameriku. Tri dni a opäť sa nič nedeje. A tak prezident Kučan zavolá Clintonovi:\r\n- Čo je Bill, prečo neodpovedáte?\r\n- Do kelu aj s tebou, Milan! Počkaj, len čo vás objavíme na mape, uvidíš čo s vami urobíme!!!', 568, 3.83, 5),
	(1693, 'Plavia sa dvaja zblúdilí Íri po mori na loďke. Chytia Zlatú rybku a tá im vraví:\r\n- Splním vám jedno želanie ak ma pustíte.\r\n- No, nech je namiesto slanej vody v mori Guiness - hovorí jeden.\r\nA druhý na to:\r\n- Ty chumaj, budeme musieť šťať do loďky.', 267, 3.39, 5),
	(1694, 'Česky turista zavíta na salaš, vidí baču s jeho rodinou, osem detí a vraví:\r\n- Báčo, a to jsou všetky vaše?\r\nBača odpovedá:\r\n- Hej, však čie by mali byť!\r\nČech na to:\r\n- No, to u nás máme len tak jedno, dve.\r\nA bača:\r\n- Hej, a kto vás potom naondial, že sú vás plné Tatry?!', 298, 3.49, 5),
	(1695, 'Idú Angličan, Čech a koktavý Slovák skákať z lietadla. Inštruktor hovorí:\r\n"Napočítajte do 3 a otvorte padák!"\r\nIde Angličan:\r\n"One, two, three"     zatiahne za špagát a padák sa otvorí.\r\nIde Čech:\r\n"Jedna, dvě, tři"     zatiahne za špagát a padák sa otvorí.\r\nIde koktavý Slovák:\r\n"Je-je-je-je-je-je-je-jebem ti, už som v kukurici!', 358, 3.57, 5),
	(1696, 'Dvaja Škóti sa prechádzajú po lese, pričom John povie Bobymu, že musí ísť na veľku potrebu. Boby mu poradí aby išiel za strom. Za chvíľu John kričí spoza stromu:\r\n"Boby nemáš u seba papier?"\r\n"Nebuď už taký škót a nechaj to tam."', 252, 3.58, 5),
	(1697, 'Plaví sa pirátska loď a v diaľke sa objaví malý čln. Na člne jeden človek a americká vlajka. Pirátsky kapitán vraví:\r\n- Vytiahnuť.\r\nVytiahnu ho a kapitán sa ho pýta:\r\n- Mám tu desať litrov whisky, koľko vypiješ?\r\nAmeričan: \r\n- Tri.\r\n- Málo.\r\n- Mám tu desať žien, koľko pomiluješ?\r\n- Tri.\r\nMálo. Cez palubu. Plavia sa ďalej a v diaľke čln s ruskou vlajkou, jeden človek v ňom. \r\n- Vytiahnuť. \r\nA vraví rusovi:\r\n- Mám tu desať litrov vodky. Koľko vypiješ?\r\n- Šesť.\r\n- No lepšie.\r\n- Mám tu desať žien, koľko pomiluješ?\r\n- Šesť.\r\n- No fajn, ale aj tak som lepší. \r\nCez palubu. Plavia sa ďalej a v diaľke polorozpadnutý čln, jeden človek, slovenská vlajka.\r\n- Vytiahnuť. \r\nA pýta sa slováka.\r\n- Mám tu desať litrov borovičky, koľko vypiješ?\r\n- Jedenásť, a vytiahne z vrecka ešte jeden.\r\n- Ho ho. Mám tu desať žien, koľko pomiluješ?\r\n- Jedenásť.\r\n- A to ako?\r\n- Ty sa mi páčiš.', 949, 3.59, 5),
	(1698, 'Súťažili Američania, Francúzi a Rusi, kto vydrží dlhšie v chladničke. Francúzi vydržali podporovaní šampanským sotva deň, Američania podporovaní whisky vydržali tri dni. Rusi si vzali tri basy vodky... Prejde týždeň a oni nevychádzajú... prejde mesiac... Francúz sa už začne strachovať, hovorí Američanovi:\r\n- Otvor ich, kto vie či sú ešte na živé?\r\nAmeričan teda otvorí, dostane bagandžou kopanec do hlavy a z chladničky počuť:\r\n- Voloďa, prečo si ho kopol?\r\n- Ešte sa pýtaj, jobtvojumat! Zima je tu ako v riti a on otvára dvere!!', 576, 3.25, 5),
	(1699, 'Ide černoch po lese a na strome uvidí kukučku.\r\n- Kukučka, vyvešti mi budúcnosť! \r\nKu-kuk, ku-kuk, ku-klux klan...', 121, 3.34, 5),
	(1700, 'Vyťahujú sa  Rus a Nemec jeden pred druhým, komu lepšie brzdí auto. Dohodnú sa, že to vyskúšajú. Nemec posadí Rusa do svojho BMW a rozbehne to 180-kilometrovou rýchlosťou proti betónovej stene. Keď sú tak 100 metrov od steny, pýta sa Nemec Rusa:\r\n- Už si sa strachom pošťal?\r\n- Pošťal. - prizná sa Rus.\r\nNemec na to dupne na brzdy a zastaví to tesne pred stenou. Potom vezme Rus Nemca do svojho Žiguláka a rozbehne sa 150 kilometrovou rýchlosťou proti betónovej stene. Keď sú tak 100 metrov od steny, pýta sa Rus Nemca:\r\n- Už si sa strachom pošťal?\r\n- Pošťal. - prizná sa Nemec.\r\n- No, môžeš sa aj posrať! Lebo toto ja veru neubrzdím...', 679, 3.66, 5),
	(1701, 'Ide černoch po pralese s urnou v rukách.\r\nĎalší černosi sa ho pýtaju:\r\n"Kde si zohnal instant?"', 102, 3.26, 5),
	(1702, 'Američan, Francúz a Rumun sa stretnú na medzinárodnej konferencii a bavia sa okrem iného aj o ženách, o tom, či sú im neverné.\r\n- Ja idem na to sofistikovane, - chváli sa Amík, - pred odchodom z domu všade nainštalujem skryté kamery a mikrofóny a tak zistím, či ma podvádza alebo nie.\r\n- Ja mám tiež svoj systém, - tvrdí Francúz - vyvinul som špeciálnu voňavku, ktorou keď ju postriekam, okmažite zistím, či bola z iným chlapom...\r\n- Ja do toho toľko neinvestujem - priznáva sa Rumun - vždy keď sa vrátim zo služobnej cesty, zazvoním najskôr u susedky. Pozriem sa jej hlboko do očí a poviem jej "Ty kurva!" Ona sa vtedy strašne naserie a začne kričať: "Ja? Ja, že som kurva? Keby si vedel čo tvoja žena robí, kým si ty preč..."', 779, 3.36, 5),
	(1703, 'Starému škótovi prišlo pozvanie na oslavu. Na pozvánke bolo napísané: "Nápoje a jedlo sú grátis." Kedže škót neovládal cudzie jazyky, ostal radšej doma. Na druhý deň ho našli  mŕtveho so slovníkom cudzích slov v ruke.', 238, 3.34, 5),
	(1704, 'Idú dvaja po púšti a jeden nesie dvere z auta,a vraví:"Je mi teplo!" druhý na to:"Tak si otvor okno!"', 106, 4, 5),
	(1705, 'Angličan príde na Slovensko a ubytuje sa v  hoteli na izbe 222. Večer si chce objednať na izbu dva rumy, a tak zavolá na recepciu:Tu rums tu ruum tututu.Tramtarara, ty debil - odpovedá recepčný.', 202, 3.96, 5),
	(1706, 'Príde smädný český turista k potôčiku a začne z neho piť. Zrazu naňho bača kričí:\r\n"Halooo, nepite tú vodu, je otrávená!!!"\r\nČeský turista sa otočí a vraví:\r\n"Co říkate?"\r\nA bača mu odpovedá:\r\n"Pite pomaly lebo je studená."', 249, 4.1, 5),
	(1707, 'Príde Slovák do českého obchodu a pýta sa:- Máte vajcia? Predavačka: - A kolik? - Kolik si strčte do prdele, ja chcem vajcia. - odpovie Slovák', 151, 4.06, 5),
	(1708, 'Príde Slovák k anglickému zubárovi, otvorí ústa a povie: "Tu." Zubár mu vytrhne dva zuby. Príde do krčmy a sťažuje sa kamarátovi, že mu zubár vytrhol dva zuby. Ten mu povie, že po anglicky "tu" znamená dva. Ide teda chlapík na ďalší deň opäť k zubárovi, otvorí ústa a povie: "Ten.."', 308, 4.08, 5),
	(1709, 'Príde Japonec do baru a povie: "Mink wink nink Coca cola!"\r\nA barman na to: "Dva deci čoho?"', 94, 3.5, 5),
	(1710, 'Viete ako vyzerá rodinná fotka somálcov?\r\n Ako čiarový kód.', 65, 3.81, 5),
	(1711, 'Traja muži sa hádajú kto videl najčernejšiu černošku. Prvý hovorí: "Ja som videl takú čiernu, že ju nebolo vidieť ani v tme. Druhý hovorí: "Ja som videl takú, čo si namiesto čokolády odhryzla z prsta." Tretí hovorí: "To je nič, ja som videl takú, čo keď si prdla tak lietali sadze."', 307, 3.5, 5),
	(1712, 'Ocko hovorí Jankovi: "Janko,  zajtra  ti  bocian  prinesie  bračeka." Janko  odpovedá: "Oci, na  svete je  toľko  krásnych žien a ty spíš s  bocianom."', 159, 3.95, 5),
	(1713, 'Raz prišiel za náčelníkom indiánskeho kmeňa chlapček a pýta sa: "Prečo sa všetci volajú tak ako sa volajú??" A náčelník mu odpovie: "Vieš, keď sa dieťa narodí dajú ho mne, ja sa okolo seba rozhliadnem, a keď uvidím bežiacu líšku tak sa to dieťa bude volať bežiaca liška. Už tomu rozumieš POZOR SERIE PES?"\r\n', 338, 4.03, 5),
	(1714, 'Američan, Angličan a Soviet súťažia, že kto prinúti mačku zjesť pikantnú horčicu.\r\nPrvý je na rade Američan. Chytí mačku a palcom do nej natlačí horčicu.\r\n- To je násilie! - protestuje soviet.\r\nAngličan dá horčicu medzi kolieska klobásky a mačka to s chuťou zje.\r\n- To je obyčajný podvod! - protestuje Soviet.\r\nKeď je na rade, natrie mačke horčicou riť. Tá si z nej horčicu za sústavného mravčania a kvílenia vylíže.\r\n- Vidíte, súdruhovia! Dobrovoľne a s piesňou na perách!', 517, 4.06, 5),
	(1715, 'Príde cigáň do videopožičovne a pýta sa:- Máte film Cigáni idú do neba? - Nie, ale máme film Cigáni idú do práce!- Jooooj, ja horory nerád pozerám!', 162, 4.16, 5),
	(1716, 'Rus a Eskimák sa vyberú poľovať na medveďa. Idú tri hodiny a zrazu\r\nsa objaví medveď. Rus vezme pušku, namieri, a už už chce\r\nvystreliť a vtom Eskimák vraví: "Nestrieľaj! Utekajme!" Tak\r\nbežia. Bežia už dobré dve hodiny. Zrazu sa Eskimák otočí a medveďa zastrelí. "Prečo som ho nemohol zastreliť už predtým?" - čuduje sa Rus. "Lebo by sme ho museli ďaleko ťahať."', 395, 3.88, 5),
	(1717, 'Stretnú sa Slovák, Rus a Nemec. Vymyslia hru, kto dlhšie vydrží v kadibude s hadmi. Slovák vydrží minútu, Nemec hodinu a Rus rok.Potom sa Slovák s Nemcom pýtajú Rusa, ako tak dlho vydržal. Rus im hovorí: "Jedného som zabil a ostatní mu išli na pohreb."', 269, 3.18, 5),
	(1718, 'Uteká chleba cez somálsku dedinu a naháňa ho sto malých somálcov. Už-už-už ho dobiehajú, tak chleba pridá, vbehne za roh, za druhy, za tretí a celý dopotený zbadá ako je o stenu opretý rezeň a fajčí cigárko....\r\nChleba, celý dopotený sa pýta rezňa: "Rezeň a ty prečo neutekáš?"\r\nRezeň si odklepne a kľudne vraví: "Ti jebe? Mňa tu ešte nepoznajú..."', 382, 4.05, 5),
	(1719, 'Stretnú sa Rus, Slovák a Nemec. Stavia sa, kto dlhšie vydrží pod vodou.Prvý ide Rus a vydrží 1 minútu.Druhý ide Nemec a ten vydrží 4 minúty.Tretí ide Slovák, dá hlavu pod vodu a vydrží 6 minút, deň, dva dni,..Rus a Nemec to nevydržia, vytiahnu Slováka von a pýtajú sa ho: "Ako to, že si tak dlho vydržal?""No, dal som si Arwais a voľne som dýchal."', 376, 3.71, 5),
	(1720, 'Z denníku Američana na Slovensku.\r\nPO-pijem so Slovákmi.\r\nUT-skoro som umrel.\r\nST-zase pijem so Slovákmi.\r\nŠT-ľutujem, že som neumrel v utorok.', 150, 4.21, 5),
	(1721, 'Hladný černoch chytí zlatú rybku. Rybka mu hovorí: "Ak ma nezješ, splním ti 3 želania."\r\nČernoch:"Chcem byť biely, užitočný a mať lásku žien."\r\nRybka švihne chvostom a černoch sa zmení na vložku.', 215, 4.04, 5),
	(1722, 'Príde dvojica mladých slovákov do nemeckého obchodu a vraví:"Prosíme si baterky".\r\nPredavač na to:"Wie bitte??"\r\nSlováci odpovedajú:"Na čo mi budú vybité, ty debil?? Ja chcem nabite!!"\r\n', 198, 3.52, 5),
	(1723, 'Nie som Rasista, zjem aj čiernu čokoládu.. ', 46, 3.85, 5),
	(1724, 'Nemec, Rus a Slovák boli odsudený na 10 rokov Zamurovania v base. Každý má predtým ako ho zamurujú 1 prianie:\r\nNemec si praje veľa ku*iev, Rus si praje veľa vodky a Slovák veľa cigariet.\r\nSplnia im priania a zamurujú ich.\r\nO 10 rokov odmurujú Nemca a tam kopa detí, odmurujú Rusa, ten je spitý jak delo, odmurujú Slováka, ten cigareta v ústach a pýta sa: "Nemá niekto zápalku?"', 399, 4.22, 5),
	(1725, 'Slúžka budí Lady Annu uprostred noci.\r\n"Lady, lady! Vo vašej knižnici sú lupiči."\r\n"Nehovorte! A čo čítajú?"', 119, 3.45, 5),
	(1726, 'Viete prečo ruské autorádio v zákrute nehrá? \r\nLebo sa musia muzikanti držať.      ', 90, 3.95, 5),
	(1727, 'V lietadle sa rozprávajú o ťažkej finančnej situácii u nás. \r\nRadičová vraví : Otvorím okno a vyhodím 10 kg múky , nech má aspoň 10 ľudí radosť . \r\nMikloš vraví : Ja otvorím okno a vyhodím 20 kg múky, nech má radosť 20 ľudí. \r\nPilot sa na nich otočí a vraví:\r\nJa otvorím dvere a vyhodím vás oboch, nech majú radosť všetci.', 358, 3.2, 5),
	(1728, '- Prečo je Číňan žltý?\r\n- Lebo čúra protivetru. ', 56, 3.68, 5),
	(1729, 'Čech, Rus a Slovák sa dohadujú kto vie dlšie udržať tajomstvo. Rus a Slovák mlátia Čecha a ten tajomstvo nakoniec vyzradí. Potom Čech a Slovák zmlátia Rusa a ten tiež tajomstvo vyzradí. Nakoniec Rus a Čech mlátia Slováka a ten nič. Mlátia ho hodinu, dve, tri a Slovák stále nič. Nechajú ho teda a sledujú čo bude robiť. Naraz počujú ako si Slovák mláti hlavu o stenu a hovorí: Spomeň si, spomeň si..!', 434, 4.29, 5),
	(1730, 'Do you speak English?\r- Yes!\r- Name?\r- Abdul al-Rhazib.\r- Sex?\r- Three to five times a week.\r- No, no...I mean male or female?\r- Yes, male, female, sometimes camel.\r- Holy cow!\r- Yes, cow, sheep, animals in general.\r- But isn\'t that hostile?\r- Horse style, doggy style, any style!\r- Oh dear!\r- No, no! Deer run too fast...', 322, 4.21, 5),
	(1731, 'Koľko somálčanov zje jedno kurča?\r\n50, potom je už kurča plné.', 69, 3.58, 16),
	(1732, 'Policajtovi sa narodí syn. V nemocnici sa pýta lekára:\r\n- Pán doktor, no ako?\r\n- Viete, máme tu menší problém, váš syn je ako kliešť.\r\n- Prečo, cucia krv?\r\n- Nie, hlava zostala vnútri. ', 199, 4.01, 16),
	(1733, 'Chlap má zapnutú cirkulárku a reže na nej psa. Ide okolo druhý a pýta sa: \r\n- To čo robíš, prosím ťa? \r\n- Ále, psie kusy... ', 136, 3.01, 16),
	(1734, 'Drahé rádio, mohli by ste dať zahrať mojej 14 ročnej sestre Ivete, ktorú včera znásilnili v parku, pesničku od Oliny Záblackej "Prvé milovanie"?', 155, 3.61, 16),
	(1735, 'Doma zvoní niekto pri dverách, muž ide otvoriť a vidí ako tam stojí chlap a vedľa seba má položený vysávač. \r\n- Dobrý deň! Prišiel som vám ukázať náš nový úžasný vysávač. Je to novinka a vysaje úplne všetko.\r\nChlap vytiahne z vrecka sáčok z hovnami, vysype ich na koberec a vraví. \r\n- Ak ten koberec nebude po vysatí ako nový, tak tie hovná tu pred vami zožeriem.\r\nA domáci mu na to z úsmevom odpovedá. \r\n- Tak to vám idem pre príbor, lebo my nemáme elektrinu.', 501, 3.8, 16),
	(1736, 'Príde primár patológie k laborantke:\r\n- Dajte mi rýchlo nejakú veľkú fľašu.\r\n- Pán primár, práve nemáme žiadnu čistú.\r\n- Nevadí, ten med nebude pre mňa.', 170, 3.3, 16),
	(1737, 'Výkrik z márnice:\r\n- Ach, drahá, prečo si ku mne taká chladná?', 68, 3.48, 16),
	(1738, 'Ide černoch po lese a vidí na strome kukučku:\r\n- Kukulienka, vykukaj mi môj osud!\r\n- Ku -ku - ku - ku ku klux klan.', 119, 3.65, 16),
	(1739, 'Loď narazí na skaly, strašný masaker, zachráni sa len dvadsať chlapov a jedna žena. Po mesiaci je žena totálne znechutená z toho, čo sa robí na ostrove a spácha samovraždu. Po ďalšom mesiaci, muži znechutení z toho čo sa robí na ostrove, ju zakopú. Po ďalšom mesiaci, muži znechutení z toho čo sa robí na ostrove ju vyhrabú.', 352, 3.45, 16),
	(1740, 'Slepec si kúpi letenku do AMERIKY a hovorí:\r\n"Konečne  uvidím  AMERIKU."', 76, 3.71, 16),
	(1741, 'Dobrý deň teta je Jano doma?\r\nAle hej Martinko, vence už síce odniesli...', 77, 3.09, 16),
	(1742, 'Pribehne indián k náčelníkovi Vinetuovi a hovorí:\r\n-Vinetou, mám pre teba dve správy. Jednu dobrú a jednu zlú.\r\n-Tak najprv tú zlú - povie Vinetou.\r\n-Na prériu sa prihrnuli cigáni.\r\n-Uf! A tá dobrá správa?\r\n-Chutia ako bizóny.', 243, 3.59, 16),
	(1743, '- Miško, kto ťa tak pekne ostrihal? Holič?\r\n- Nie.\r\n- Mamička?\r\n- Nie.\r\n- A kto teda?\r\n- Chemoterapia.', 106, 3.03, 16),
	(1744, 'Na húsenkovej dráhe:\r\n- Klop, klop.\r\n- Kto je tam?\r\n- Tvoj obed.', 66, 2.93, 16),
	(1745, 'Dvaja sadisti:\r\n- Počuj, tebe sa páčia oči mojej ženy?\r\n- Hej!\r\n- Tak si ich zober...', 90, 3.69, 16),
	(1746, 'Ako hovorí chybný synček mamičke?\r\nOci.', 43, 3.29, 16),
	(1747, 'Ide chlapík k jazeru a pod pazuchou nesie mačku. Druhý ho stretne a pýta sa: \r\n- Kam ideš? \r\n- Prať mačku. \r\n- Mačka sa prať nedá! \r\n- Mačka sa prať dá. \r\n- Mačka sa prať nedá! \r\n- Mačka sa prať dá! \r\nO chvíľu sa vracia, pod pazuchou zdochnutú mačku.\r\n- Veď som ti vravel, mačka sa prať nedá! \r\n- Mačka sa prať dá. Žmýkať sa nedá.', 364, 3.52, 16),
	(1748, '"Mami, smrdí tady mrtvola. Mami?"', 34, 3.6, 16),
	(1749, 'Starší pán sa rozplýva nad kočíkom:\r\n- Och bože, aké krásne dieťa. A aké má krásne veľké očičká.\r\n- To áno, hovorí pyšný otec. A čím viac pritiahnem šál, tým sú väčšie.', 199, 3.41, 16),
	(1750, 'Idú dvaja skíni, jeden nesie bandasku benzínu a druhý bejzbolku. Prídu k cigánskej chatrči a zabúchajú.\r\n"Kto je?"\r\n"Kúpači!"', 136, 3.91, 16),
	(1751, 'Príprava nedelného obeda:\r\n- Detičky, rozlúčte sa so svojou najmladšou sestričkou, voda už vrie!', 104, 3.29, 16),
	(1752, 'Letel vtáčik šírim svetom, trafili ho guľometom. Letel vtáčik dole, na mínové pole. A on celý od radosti rozhadzuje vnútornosti!', 139, 3.63, 16),
	(1753, 'Krtko hľadal malé mušky, iba míny boli všade. Zakúsil však do rozbušky a už lietal po záhrade!', 104, 3.27, 16),
	(1754, 'Stretnú sa dvaja ľudožrúti a jeden nesie urnu. Druhý sa čuduje:\r\n- Fíha, to kde si zohnal instant?', 105, 3.62, 16),
	(1755, 'Správa: \r\nNa koncerte Kelly Family vybuchla bomba. Mesto je plné vlasov.', 74, 3.47, 16),
	(1756, 'Viete, aké je dokonalé vianočné prekvapenie?\r\nVtedy, keď horiaci Mikuláš s krikom padá z ôsmeho poschodia paneláku.', 125, 3.11, 16),
	(1757, 'Príde strašne škaredá žena k doktorovi s dvoma synmi. Po vyšetrení a predpisaní liekov sa jej doktor pýta:\r\n- Pani, to máte dvojičky?\r\n- A čo nevidíte, že jeden má 13 rokov a ten druhý len 3?\r\nDoktor na to: \r\n- Sa mi nechce veriť, že by vás niekto dva krát fikol.', 283, 3.78, 16),
	(1758, 'Aký je rozdiel medzi cigánom a trampolínou?\r\nPo trampolíne sa neskáče v kanadách.', 88, 3.64, 16),
	(1759, 'Ide mamička s dieťatkom cez cestu, keď zrazu prejde decko v plnej rýchlosti kamión. Kamoinista zastame, vystúpi a vraví:\r\n"Blbé, však?"', 144, 3.52, 16),
	(1760, 'Predám obézne dieťa.\r\nZn.: Na guláš pre šiestich.', 55, 4.12, 16),
	(1761, 'Je večer, Jožo pozerá telku a v tom zazvoní telefón. \r\n- Ahoj Jožo, to som ja Zuzka. Spoznali sme sa minulé leto a vtedy v aute si mi povedal, že som fajn dievča. \r\n- Á, ahoj Zuzka a ako sa máš?\r\n- No, nie veľmi dobre! Som tehotná a o desať minút skočím pod vlak!\r\n- No Zuzka, ty si fakt super dievča!', 320, 3.6, 16),
	(1762, 'Dežo a Araňa naraz padajú z dvanásteho poschodia.\r\nKtorý z nich dopadne ako prvý?\r\nA nie je to jedno?', 107, 3.3, 16),
	(1763, 'Príde chlap do pôrodnice za ženou a hľadá svojho syna, ale nikde ho nevidí. A v tom ide okolo sestrička a pýta sa jej: \r\n- Prosím vás, kde mám syna? Chcel by som si ho pochovať. \r\nSestrička mu odpovedá: \r\n- Netreba, my sme ho včera pochovali. ', 258, 3.22, 16),
	(1764, 'Aký je rozdiel medzi opitým a nafetovaným?\r\nNafetovaný lepšie horí.', 73, 3.36, 16),
	(1765, '- Pani suseda, ako sa volá váš malý synček? \r\n- Digitálky. \r\n- A to prečo? \r\n- Lebo sa narodil bez ručičiek.', 117, 4.02, 16),
	(1766, 'Pýta sa synček mamičky: \r\n- Mami, kto je tento černoch?\r\n- Nedotýkaj sa otecka, ešte je pod prúdom!', 106, 3.38, 16),
	(1767, 'Hovorí synček mamičke:\r\n- Mami, ja by som chcel psíka.\r\n- Tak si odkroj. V chladničke ešte kúsok je.', 107, 4.02, 16),
	(1768, '- Mami, prečo je ocko taky bledý?\r\n- Diskutujeme alebo pitváme?', 66, 3.32, 16),
	(1769, 'Vianoce. Evička kričí na bračeka: \r\n- Cha, chaaa, zasa som dostala dvanásť darčekov a ty len sedem. \r\nBraček: \r\n- Nech, ja nemám rakovinu.', 147, 3.5, 16),
	(1770, 'Žiadne hovno nie je dokonalé, každé má svoje muchy .', 57, 3.36, 16),
	(1771, 'Partneri po milovaní odhodili kondóm na verejné miesto. Neskôr išla okolo babka, ktorá zbadala kondóm, zodvihla, oblizla a povzdychla si: \r\n"Ej tá dnešná mládež  odhodí aj kožku z Mlieka!"', 202, 3.57, 16),
	(1772, 'Viete čo je to maximálny boj proti alkoholizmu?\r\nKeď zastrelíte dieťa so sáčkom rumových praliniek!', 107, 3.55, 16),
	(1773, 'Nikdy nemožno dostatočne zdôrazniť problémy, ktoré spôsobuje nadmerné podávanie kyanidu draselného novorodencom...', 124, 3.3, 16),
	(1774, 'Idú dvaja slovenskí turisti v Tatrách pod lavínovým previsom a jeden hovorí:\r\n- Dávaj bacha. Teraz stačí slovo po česky a jebne to na nás.', 149, 3.77, 16),
	(1775, 'Je to žlté a plazí sa to v tráve?\r\n- Číňan hľadá mínu.\n\r\nJe to žlté a lieta to?\r\n- Číňan mínu našiel.', 118, 3.96, 16),
	(1776, 'Čo spravíme, keď dostane epileptik záchvat vo vani práve keď sa kúpe?\r\nPridáme prášok a špinavé prádlo!', 116, 3.73, 16),
	(1777, 'Po líčku ti steká slza veliká...\r\nTo nie slza, to ti oko vyteká...', 71, 3.33, 16),
	(1778, 'Už to dlhšie nevydržím, nemôžem bez teba existovať. Snívam o tom, že sa spojíme a budeme spolu až do smrti. Ver mi, že ťa nikdy neopustím.\r\nTvoj vírus H.I.V.', 172, 3.09, 16),
	(1779, 'Cowboy vyjde z baru a pobozká koňovi zadok. Ostatní sa ho pýtajú: \r\n- Pomáha to? \r\nA on odpovedá: \r\n- Ani veľmi nie, ale menej si potom oblizujem pery.', 159, 3.2, 16),
	(1780, '- Naša babka mala vždy pekný pohľad.\r\n- No vidíš, tak si jej oči dajme do vitrínky.', 91, 3.12, 16),
	(1781, 'Na veľkej budove vypukne požiar a jedinou možnosťou ako uniknúť je skočiť do plachty. Požiarníci sa rozostúpia a čakajú. Vyskočí beloch - chytia ho. Vyskočí druhý beloch - chytia ho, ale keď vyskočí cigáň tak sa uhnú. Vyskočí druhý - uhnú sa. Jeden požiarnik to nevydrží a zakričí hore:\r\n- Tých zhorených už nehádžte!', 355, 3.66, 16),
	(1782, 'Starý, bohatý dedko náhle zomrel. Jeho synovia mu pripravujú pohreb. Jim hovorí:\r\n- Vystrojíme mu pohreb za 100 mariek.\r\nJohn hovorí:\r\n- Celkom by stačil aj za 50.\r\nDedko sa zdvihne a prevraví:\r\n- Hádam by som na ten cintorín prišiel aj sám.', 254, 3.38, 16),
	(1783, 'Neskoro v noci sa po cintoríne prechádza muž a vidí ako sa pri nejakom hrobe miluje muž s jednou ženou. Po chvíli k ním pristúpi muž, ktorý ich pozoruje a vraví:\r\n- Hej, požičajte mi ju na chvíľu nech sa aj poteším!\r\nA muž mu odpovedá:\r\n- Táto je moja, tam je lopata, vyhrab si svoju!', 305, 3.37, 16),
	(1784, 'Mamička vola na svoje deti:\r\n- Deti, nehojdajte sa, dedko sa nie preto obesil!', 79, 3.41, 16),
	(1785, 'Príde Mikuláš do osobitnej školy a hovorí:\r\n- Kto mi povie básničku, tak dostane krásny darček. \r\nPrvý sa prihlási Móricko a spustí: \r\n- Bla-ble-vru-cu.\r\nA Mikuláš na to: \r\n- A kto bude robiť blbosti, nedostane nič!', 232, 3.11, 16),
	(1786, '- Tak čo, pán Jozef, prečo ste neboli na pohrebe vašej svokry?\r\n- Ale viete ako to je. Samá práca a na zábavu neostáva čas.', 132, 3.32, 16),
	(1787, 'Gluckstein a Rosenzweig sú na popravisku. Veliteľ popravčej čaty sa pýta: \r\n- Kto si praje šatku na oči?\r\nGluckstein rázne zavrtí hlavou a Rosenzweig mu hovorí: \r\n- Gluckstein, nerob potiaže!', 202, 2.72, 16),
	(1788, 'Telefonát do rádia:\r\n- Nemám rad mačky. Ten zápach, všade tie chlpy...\r\nRádio:\r\n- Pradepodobne neviete mačku správne upiecť.', 134, 3.31, 16),
	(1789, 'Zvoní telefón. Mladý muž zodvihne sluchátko a na druhom konci sa ozve:\r\n- Ahoj. Tu je Zuzka. Stretli sme se pred štvrť rokom na jednom mejdane.\r\n- Zuzka? Pred štvrť rokom?\r\n- Len si spomeň! Potom si ma viezol domov. Cestou sme zastavili a sklopil si sedadlá. Hovoril si mi, že som fajn baba a ...\r\n- Jasné, Zuzka! To som rád, že si zavolala. Ako sa máš?\r\n- Strašne. Som v tom a za desať minút si ľahnem pod vlak.\r\n- Ty si vážne fajn baba!', 461, 3.47, 16),
	(1790, 'Kanibal hovorí žene:\r\n- Nemám rád tvoju mamu!\r\n- Tak nechaj tak a odlož ju na kraj taniera.', 96, 3.45, 16),
	(1791, '- Počúvaj Kristian. Keď sa budeš stále točiť dookola, priklincujem ti aj druhú nohu.', 92, 3.37, 16),
	(1792, 'Babke odtrhne vlak nohy a kričí:\r\n- Moje nohy, moje nohy. \r\nIde okolo vojak a hovorí:\r\n- Babka, čo kričíte, veď žiadne nemáte.', 135, 3.39, 16),
	(1793, 'Pribehne mladý upír do pekárne a kričí:\r\n- Chlieb, chlieb, rýchlo dajte mi chlieb. \r\nPredavačka na neho: \r\n- Veď upíri chlieb nejedia. \r\n- Ale za rohom je havárka, idem si namáčať.', 193, 4.14, 16),
	(1794, 'Hra na ampérmeter:\r\nSkupina malých deti namočí ruky do vody a pichnú ich do zásuviek. To dieťa, ktoré vyhodí prvé poistky  JE AMPÉRMETER.', 148, 3.2, 16),
	(1795, '- Haló rádio RockFM? Chcem pesničkou povzbudiť môjho priateľa Petra, ktorému sústruh odtrhol obe ruky. Zahrajte mu, prosím, "Sám s nohami na stole". ', 159, 3.89, 16),
	(1796, 'Chlap príde do krčmy a stále si opakuje:\r\n- Toto nevysvetlím, toto naozaj nevysvetlím, nevysvetlím to.\r\nKeď to asi hodinu opakuje, zvedavý barman sa ho pýta:\r\n- Prepáčte, ale čo nevysvetlíte? \r\nChlap to nechce povedať, ale potom povolí.\r\n- Viete, včera som dojil kravu a ako ju tak dojím, kopla má ľavou nohou. Tak som jej ľavú nohu priviazal o zábradlie v maštali. Dojím, dojím a potvora, kopla má pravou nohou, ktorú som jej tiež priviazal o zábradlie. Keď som si myslel, že je už koniec, krava ma ovalila chvostom. To ma už naozaj naštvalo, dal som si dole opasok a chvost som jej priviazal o strop. Keď som vstal od kravy, spadli mi nohavice a vtom prišla moja žena. Ako jej to preboha vysvetlím?', 738, 3.66, 16),
	(1797, 'Rozprávajú sa traja nekrofili o tom, aké majú najradšej. Prvý hovorí:\r\n- Ja takú trojdňovú, takú ešte teplú.\r\nDruhý: \r\n- Ja takú polročnú.\r\nOstatní sa ho pýtajú, prečo?\r\n- No, pustíš do nej trocha elektriky a je ako živá.\r\nTretí sa pridá: \r\n- Ja mám najradšej také už staršie. Pichneš si, kde chceš.', 333, 3.03, 16),
	(1798, 'Viete aký je rozdiel medzi polenom a dieťaťom?\r\nPo dieťati je špinavšia píla.', 84, 3.54, 16),
	(1799, 'Príde pani do cukrárne s dvoma mŕtvymi deťmi a vraví predavačke: \r\n- Prosím si dva venčeky...', 101, 3.51, 16),
	(1800, 'Kde nájdeš beznohú korytnačku?\r\nTam, kde si ju nechal.', 58, 3.21, 16),
	(1801, '- Jožko, prestaň sa špárať starému otcovi v nose, lebo zavriem rakvu!', 75, 3.47, 16),
	(1802, 'Chceš ma? Už ma malo veľa ľudí, niektorí aj trikrát a málokto sa sťažoval. Tak sa ponáhľaj a čoskoro budem s tebou. Už sa na teba teším..\r\nTvoj infarkt.', 168, 3.27, 16),
	(1803, 'Malý Janko príde domov a hovorí: \r\n- Oci, dostal som päťku, dúfam že má nehodíš do šachtyyyyyyyyy...', 111, 3.05, 16),
	(1804, 'Viete, aké sú tlmiče na Trabante? \r\nCestujúci.', 50, 3.14, 16),
	(1805, 'Čo je hnus?\r\nKopec mŕtvych deti.\r\nA čo je ešte vačší hnus?\r\nŽivé dieťa pod kopou, ktoré sa snaží prežrať si cestu nahor.', 135, 2.81, 16),
	(1806, 'Aký je rozdiel medzi vlečkou plnou detí a sklenených guľôčok?\r\nGuľôčky nemôžete vyhádzať vidlami.', 111, 3.06, 16),
	(1807, 'Američania  poslali Somálcom žalúzie.\r\nSomálci sa im pekne poďakovali za poschodové postele.', 99, 3.48, 16),
	(1808, 'Dvaja kamaráti sa dohodnú, že vykradnú banku. Keď otvárajú trezor, nájdu len vanilkové pudingy a tak ich začnú jesť. Na druhý deň sa na titulnej strane novín objaví nadpis: \'Neznámi páchatelia vykradli spermobanku\'. ', 234, 3.6, 16),
	(1809, 'Viete aký bol najväčší lekársky zákrok v dejinách ľudstva ?\r\nHromadné rentgenovanie pri Hirošime a Nagasaki.', 119, 3.46, 16),
	(1810, 'Máte problémy so svojim sexuálnym životom?\r\nSkúste to s ježkom.', 69, 3.23, 16),
	(1811, 'Mama vraví synčekovi: \r\n- Jožko, nehojdaj sa na babke, nie preto sme ju obesili!', 83, 3.31, 16),
	(1812, 'Príde matka s chlapčekom k lekárovi, lebo sa jej zdá, že synček má na svoj vek priveľkú hlavu. \r\n- Pán doktor, je to v poriadku?\r\n- V poriadku, hovorí doktor, to je vodnatielka. Nič to, ale v zime pozor - treba doliať Fridex.', 238, 3.15, 16),
	(1813, 'Príde pohrebné auto pred panelák. Pani Nováková sa vykloní z okna a kričí:\r\n"Čo tu chcete, tu nikto neumrel!"\r\n"Hľadáme pani Novákovú!"\r\n"To som ja, a čo chcete?"\r\n"Ale, vezieme vám deti z tábora!!!"', 215, 4.01, 16),
	(1814, 'Ide hrbáč v autobuse. Z vrecka mu vypadne krabička CAMELIEK. \r\n- Mladý pánko, - hovorí babka vedľa - vypadol vám občiansky preukaz!', 140, 3.3, 16),
	(1815, 'Synček sa ráno zobudí a vojde do kuchine za otcom a hovorí vystrašeným hlasom:\r\n"Ocko, Ocko, mne sa v noci snívalo, ťe ma znásilnil capko."\r\nOtec sa pohladí po brade a hovorí:\r\n"Tak capko vravíš!"', 209, 3.42, 16),
	(1816, 'Vdovec, ktorý sa druhý krát oženil si nezaslúžil stratiť prvú ženu.', 76, 3.26, 16),
	(1817, 'Ako spoznáte, že dieťa bolo počaté pomocou viagry?\r\nKeď sa narodí, hneď sa postaví.', 92, 3.2, 16),
	(1818, 'Príde muž na chirurgiu a vraví doktorovi: \r\n- Mohli by ste mi vybrať ten nôž zo zadku, veľmi to boli. \r\nDoktor mu hovorí: \r\n- Momentálne štrajkujeme, choďte niekde inde. \r\n- Ale naozaj to bolí. \r\n- Hovorím vám, choďte niekde inde.\r\n- Mali ste už niekedy nôž v zadku? Viete ako to bolí?\r\nDoktor mu vytrhne nôž zo zadku, vrazí mu ho do oka a povie: \r\n- Choďte na očné, nech vám ho vyberú. ', 414, 3.66, 16),
	(1819, 'Príde muž domov a pýta sa priateľky, že kam ide.\r\n- Idem k maminke, lebo som počula, že si pedofil.\r\n- Ale ty to ešte nechápeš, veď máš iba 12 rokov.', 162, 3, 16),
	(1820, 'Čo si povie rasistický taxikár keď zbadá na prechode japonku?\r\n\'Na túto žltú ešte prejdem!\'', 100, 3.69, 16),
	(1821, 'Naliehavá správa v rozhlase:\r\n\'Včera večer sa stratil sedem ročný chlapček  spolu s nemeckým ovčiakom, ktorý počúva na meno Buck. Ak ste niekde zazreli takéhoto psa ozvite sa prosím na telefónne číslo: xx/xxx xxx.\'', 231, 2.79, 16),
	(1822, '- Mami, môžem vylízať misu?\r\n- Dnes nie, radšej to spláchni!', 66, 3.31, 16),
	(1823, 'Ide muž okolo cintorína a vidí ako hrobár vykopáva všetky hroby. Nejde mu to do hlavy a tak ide za ním a pýta sa ho: \r\n- Počuj, hrobár a prečo vykopávaš všetky tie hroby?\r\nA hrobár mu na to hovorí: \r\n- Ale, hovorili mi, že tu je bomba a tak evakuujem.', 268, 3.48, 16),
	(1824, '- Mototechna? Tu krematórium! Koľko ste včera predali tých nových japonských motoriek?\r\n- No, asi dvadsať, prečo?\r\n- Dvadsať, hej? Tak to sa nám ešte tri flákajú niekde po meste!', 191, 3.64, 16),
	(1825, 'Angličan, Austrálčan a Juhoafričan sú spolu v jednom bare v Londýne a popíjajú pivo. Juhoafričan dopije, vyhodí pohár do luftu, vyberie pištol, strelí a pohár na rozsype na malé kúsočky. \r\n- My v Južnej Afrike máme také lacné poháre, že nepotrebujeme piť z jedného pohára dvakrát.\r\nAustrálčan je vyjavený, tak tiež urobí to isté a hovorí: \r\n- My v Austrálii máme toľko piesku na výrobu pohárov, že nepotrebuje piť z jedného pohára dvakrát.\r\nAngličan ale ostáva chladný. Vypije pivo, vyhodí pohár do vzduchu, vyberie zbraň, zastrelí Juhoafričana a Austrálčana a hovorí: \r\n- V Anglicku máme toľko Juhoafričanov a Austrálčanov, že nepotrebujeme piť s tými istými dvakrát.', 733, 3.66, 16),
	(1826, 'Traja chlapi sa rozprávajú, kto má akú škaredú svokru.\r\nPrvý vraví: "Moja svokra je taká škaredá, že keď sa ráno pozrie do zrkadla, tak praskne."\r\nDruhý vraví: "Keď sa moja svokra pozrie na mlieko, tak skysne."\r\nTretí vraví: "Chlapi, tak na moju svokru nemá nik. Keď zomrela, tak sme jej museli vykopať dve jamy. Do prvej sme ju pochovali, a do druhej chodili červi rýhať.', 397, 3.36, 16),
	(1827, 'Sedia dvaja rybári na brehu jazera a pozerajú na krásnu ženu, ktorá sa lyžuje na vode. Zrazu spadne a potopí sa. Rybári sa po nejakom čase zdohadujú a utekajú ju zachrániť. Vyberú ženu na breh a jeden z nich jej začne dávať umelé dýchanie. Zrazu povie:\r\n- Fúj, ta totej smrdí z tých úst.\r\nDruhý na to zareaguje a povie:\r\n- Ty počúvaj, však tá má vetrovku aj korčule.', 397, 3.41, 16),
	(1828, 'Ako zblbneme slepé dieťa?\r\nPremiestnime mu nábytok.', 54, 3.23, 16),
	(1829, 'Samo-vražda, s.r.o. uvádza: Príručka na spáchanie samovraždy.\r\nPre tých, ktorí veria, že všetko dobre dopadne: prilepte si na hlavu dynamit a zapálte ho. Potom stačí len dúfať, že to nebuchne.\r\nPre tých, ktorí chcú dať o sebe vedieť: ukradnite lietadlo, čím väčšie, tým lepšie, a pokúste sa pristáť na piatom poschodí desaťposchodovej budovy.\r\nPre tých, ktorí chcú spáchať viac: postupujte podľa návodu pre tých, ktorí veria, že všetko dobre dopadne. Uskutočnite to v autobuse plnom ľudí.\r\nPre nerozhodných: stačí si vybrať...\r\nPre tých, ktorí robia všetko podľa návodu: nech si prečítajú tento návod.\r\nPre nenápadných: jeden gram kianidu je pre dvoch akurát.\r\nSamo-vražda, pre všetkých, ktorí čakali od života viac. ', 786, 2.77, 16),
	(1830, 'Spoločnosť Metro - Goldwyn - Mayer sa ospravedlňuje obyvateľom New Orleansu za malé nedorozumenie pri natáčaní pokračovania filmu Vodný svet.', 151, 3.44, 16),
	(1831, 'Idú dve vložky po ulici a stretnú krvavú, tá sa ich pýta:\r\n"Hej vložky,kam idete?"\r\n"Bojovat."\r\n"A môžem ísť s vami."\r\n"Nie,ranených neberieme."', 156, 3.19, 16),
	(1832, 'Kto bol najväčší flegmatik?\r\nJánošík. Celý život mal na háku.', 71, 3.05, 16),
	(1833, '- Pán doktor, čo mi je?\r\n- Keď umriete, budem múdrejší...\r\n- A potom mi poviete, čo mi je?', 97, 3, 16),
	(1834, '- Čím bol váš otec?\r\n- Tuberákom.\r\n- Nie, nie, ja myslím, čo robil?\r\n- No, kašľal.\r\n- Ale veď z toho predsa nemohol vyžiť!\r\n- Však aj zomrel. ', 155, 3.22, 16),
	(1835, '- Fero, nevieš ako by som sa zbavil svojej ženy?\r\n- Skús ju zastreliť!\r\n- Už som ju zastrelil, ale ja sa pýtam, ako sa jej mám zbaviť.', 142, 3.16, 16),
	(1836, '- Prečo máte toľko deti?\r\n- Nemali sme ešte vtedy peniaze na televízor!', 76, 3.3, 16),
	(1837, 'Príde Dežo do nemocnice lebo manželka mu porodila bábätko. Už sa k nemu blíži sestrička s dieťaťom. Dieťa zabalené do perinky, voňavé a milé. Zrazu sestrička chytí dieťa, otrieska ho o radiator, dvere, lôžko a vyhodi ho oknom.\r\n"Haha, bolo už mŕtve po pôrode."', 284, 2.84, 16),
	(1838, 'Ide horár po lese a nájde totálne roztrhaného muža. Muž je úplne na cucky. \r\n"Čo sa to dejú za veci?"\r\nPovie horar a ide ďalej. O sto metrov nájde tak isto znetvorenú ženu. \r\n"Čo sa to dejú za veci na tomto svete?"\r\nIde ďalej a o sto metrov nájde plakať malé dievčatko.\r\n"Čo sa ti stalo?"\r\n"Medveď mi roztrhal mamu a otca."\r\n"To máš dnes fakt blbý deň."\r\nPovie horár a stiahne si nohavice.', 416, 3.43, 16),
	(1839, 'Babka leží v posteli, vedľa cca 1.5 m stojí karkulka a pýta sa:\r\n"Babka, babka prečo máš také veľké oči ?"\r\n"Stojíš mi na prsníku."', 146, 3.64, 16),
	(1840, '"Mamička, prečo staviaš ten vianočný stromček už v máji?"\r\n"Pretože nám ty malý tuberáčik už asi do vianoc nevydržíš!"', 135, 3.18, 16),
	(1841, 'Aký je to absolútny vodič?\r\nJe to vodič, ktorý zomrel a aj sa narodil pri gumovom defekte.', 95, 3.16, 16),
	(1842, 'Střetnou se dvě susedy a jedna říká druhé: \r\n- Slyšela jsem, že váš muž je nemocen. \r\n- No jó, víte, on má něco s patama. \r\n- S patama? Na to ste jako přišla? \r\n- Když já jsem volala do nemocnice a tam mně přepojili na ňákou patologii či co. ', 266, 3.53, 16),
	(1843, '- Aha mami, ako sa tu dobre hojdá!\r\n- Janko, prestaň sa hrať so starým otcom. A vôbec, čo robíš pri šibenici?', 118, 2.48, 16),
	(1844, 'Príde maník v monterkách na intenzívku a hovorí:\r\n"Chlapi na tri zadržte dych,mením poistky!"', 100, 3.39, 16),
	(1845, 'Po rieke v člne závratnou rýchlosťou vesluje indiánka. V kánoe sa vezie aj náčelník a nerušene fajčí fajku. Od brehu naňho kričí kolega náčelník :\r\n"Bratu poď na fajku mieru !"\r\n"Nemôžem, veziem ženu do pôrodnice!"', 237, 3.09, 16),
	(1846, 'Aký je rozdiel medzi čiernym a sadistickým humorom?\r\nČierny:keď je desať detí v jednom smetiaku a sadistický :keď je jedno dieťa v desiatich smetiakoch.', 162, 3.28, 16),
	(1847, 'Viete že Lady Diana bola v rádiu.\r\nJasné,aj v zapalovači a na palubnej doske.', 81, 3.04, 16),
	(1848, 'Príde mikuláš do Somálska a pýta sa detí.\r\n- Prečo ste také chudé deti?\r\n- My nejeme!\r\n- No kto neje, nedostane darčeky. ', 131, 3.53, 16),
	(1849, 'Otec synovi:  \r\n- Ja som bol v Afganistane.\r\nSyn skloní hlavičku. Otec pokračuje:\r\n- A ja som bol aj v Černobyle.\r\nSyn skloní aj druhú hlavičku.', 151, 3.27, 16),
	(1850, 'Ide vozíčkar cez koľajnice a naraz sa mu zasekne koleso medzi koľaje. Vlak je už 20 metrov od vozíčkara a vozíčkar kričí: \r\n- Rampár, rampár...\r\nRampár nič.  Vlak je už 10 metrov od vozíčkara a ten zasa kričí:\r\n- Rampár, rampár...\r\nA rampár zasa nič. Vlak je už 5 metrov od vozíčkara a ten zasa kričí:\r\n- Rampár, rampár...\r\nRampár vybehne von a pýta sa:\r\n- Čo je, čo kričíš?\r\nA vozíčkar hovorí: \r\n- Pozeraj na tú šupu.', 461, 3.51, 16),
	(1851, 'Nováka trafí v krčme šľak a nikto nevie, ako to povedať jeho manželke: \r\n- Dobrý deň, vy ste vdova Nováková?\r\n- Som Nováková, ale nie vdova.\r\n- Stavíme sa?', 169, 3, 16),
	(1852, 'Na Titaniku pribehne zdesený pasažier ku kapitánovi a silno ním lomcuje. Pri tom sa ho pýta:\r\n- Ako ďaleko je najbližšia pevnina? \r\nKapitán mu odpovedá:\r\n- 2 míle.\r\n- Áno? To je predsa užasne! A ktorým smerom?\r\n- Smerom nadol!', 240, 3.58, 16),
	(1853, 'Výkrik z hladomorne:" Dupľu!"', 31, 3.49, 16),
	(1854, 'Viete, čo je to pozitívny rasizmus?\r\nKeď kúpete černocha v save.', 69, 3.06, 16),
	(1855, 'Je to zelené, zavrčí to, a je to červené. Čo je to?\r\nNo predsa žaba v mixéri.', 85, 3.04, 16),
	(1856, 'Muž zabije svoju ženu a nevie kam by ju schoval.Rozhodne sa, že ju zakope na záhrade. Lenže zakopal ju tak, že jej trčal iba zadok!\r\nO pár dní na to, príde za ním polícia.Nájdu zakopanú ženu a pýtajú sa ho:\r\n"Prečo ste ju zakopali tak plytko? Veď ste vedeli, že ju nájdeme!"\r\n"No vedel, ale dobre sa mi tam parkoval bicykel !"', 347, 3.91, 16),
	(1857, 'Ide staršia pani po parku a vidí ako jedna mamička svojmu decku búcha hlavu o strom.Príde k nej a hovorí:\r\n"Nebúchajte mu tú hlavu tak silno, veď mu spadne čiapka!"\r\n"Nebojte sa, nespadne, ma jú pribitú!"', 216, 3.23, 16),
	(1858, 'Po ulici ide dôchodca  a za ním dvaja cigáni. Jeden z nich vytiahne nôž a hovorí:\r\n- Poďme si zapichať!', 111, 2.73, 16),
	(1859, 'Čo sa volá vrchol staroby?\r\nKeď aj parochňa ošedivie.', 58, 3.01, 16),
	(1860, 'Traja horolezci lezú na K2 a jeden z nich nešťastnou náhodou skĺzne a padne do trhliny. Ostatní kričia:\r\n- Si v poriadku? Nohy a ruky máš celé?\r\n- Áno.\r\n- Tak vylez hore.\r\n- Ja ešte letím.', 201, 3.25, 16),
	(1861, 'Janko sa pýta maminky:\r\n"Maminka, prečo má náš otecko v chrbte štyri diery?"\r\n"Buď prosím Ťa ticho a utieraj tie vidly!"', 129, 3.14, 16),
	(1862, 'Práve prebieha pohreb tragicky zosnulej princeznej Diany. Na pohrebe sa zúčastňujú tisícky ľudí. Prichádza princ Charles, manžel zosnulej, spolu so svojimi dvoma synmi. Mladší syn s údivom pozerá, koľko veľa ľudí je na pohrebe jeho matky a pýta sa otca:\r\n- Otec a prečo je tu tak veľa ľudí?\r\nPrinc Charles sa pozrie na svojho syna a odpovie mu:\r\n- Vieš synček, Elton John nespieva každý deň!', 419, 3.18, 16),
	(1863, 'Ako zvádza malomocné dievča chlapca?\r\nHádže po ňom oči.', 62, 3.29, 16),
	(1864, 'O šiestej večer príde chlapík s nožom v chrbte na chirurgiu, ale doktor mu hovorí: \r\n"Prepáčte, ale mi už zatvárame, príďte zajtra."\r\n"A to mám byť celú noc s týmto nožom v chrbte?"\r\nDoktor podíde k nemu, vytiahne mu nož z chrbta, vrazí mu ho do oka a hovorí:\r\n"Choďte na očné, tam sú do ôsmej!"', 321, 3.3, 16),
	(1865, 'Právnik zaparkuje svoj úplne nový Mercedes 600 SEL priamo pred kanceláriou. Vtom, ako vystupuje, okoloidúci kamión odtrhne celé dvere na vodičovej strane. Rozčúlený právnik kričí:\r\n- Môj nový mercedes! Už nikdy nebude ako predtým! Ty sviňa jedna kamionistická!\r\nVodič kamiónu sa len znechutene vykloní a hovorí:\r\n- Vy právnici ste takí nechutní materialistickí blbci, že to ani nie je možné! Mercedes si všimnete, ale že vám chýba polovica ľavej ruky, to vás netrápi, čo?!\r\n- Preboha! Kde mám rolexky?', 541, 3.49, 16),
	(1866, 'Vieš, ako sa hovorí žene, ktorá s istotou vie, kde sa v noci nachádza jej muž?\r\nVdova.', 92, 3.3, 16),
	(1867, 'V kupé vo vlaku sedia oproti sebe stará cigánka a mladík. Cigánka je strašne škaredá, tučná a príšerne smrdí. Medzi stehnami má položený melón, ktorý brutálne požiera, pričom strašne mľaská, grgá a prdí. Mladík sa už na to nedokáže pozerať a vraví jej: \r\n"Pani, že nehygienicky jete, to by som ešte zniesol. To, že smrdíte, sa dá tiež ešte vydržať, ale prosím Vás, aspoň tie nohy si dajte spolu, veď ani nohavičky nemáte, kto sa má na to pozerať!"\r\nCigánka mu na to: \r\n"Dik no určite, ja si dám nohy spolu a všetky muchy mi pôjdu na melón!"', 595, 3.54, 16),
	(1868, 'Prechádza sa dedko po kostole, pristaví sa pri soche Ježiša a pýta sa ho: \r\n- Ježiš, keď zomriem, čím budem v druhom živote? \r\nJežiš na to: \r\n- Budeš hrať futbal. \r\nDedko oponuje:\r\n- Ale ja som v živote futbal nehral! \r\n- To nič, hovorí Ježiš. Trénuj, o týždeň máš zápas. ', 299, 3.37, 16),
	(1869, 'Rozprávajú sa dvaja susedia:\r\n- Ako sa volajú tie tabletky, čo predpísal zverolekár tvojim sviniam na zvýšenie potencie?\r\n- Neviem, ale chutia ako karamel.', 163, 3.17, 16),
	(1870, 'Stoja dvaja pred horiacim domom:\r\n"Cítim tu karamel."\r\n"Áno, dedko mal cukrovku."', 83, 3.33, 16),
	(1871, 'Rozprávajú sa dvaja patológovia po šichte a jeden hovorí:\r\n"Počuj, dnes som mal jednu pacientku, takú starú babku, a tá ti mala klitoris jak kvasák."\r\n"Čo, taký velký?"\r\n"Nie, taký kyslý!"', 203, 3.11, 16),
	(1872, 'Zákazník v obchode s pohrebnými vecami si prezerá truhly.\r\n"Čo si myslíte, akú truhlu je lepšie si kúpiť ?" \r\n"Ťažko povedať,"- odpovedá predavač, -"zinkové, samozrejme, dlhšie vydržia, ale drevené sú lepšie pre zdravie."', 242, 3.34, 16),
	(1873, 'Príde ľudožrút do pôrodnice a berie si jedno dieťa. Sestrička na neho kričí:\r\n- Počkajte, ja vám ho zabalím.\r\n- Netreba. Ja ho zjem cestou.', 151, 3.25, 16),
	(1874, 'Pacienta prevážajú sanitkou. Zrazu si pacient všimne, ako sa vodič sanitky chytí oboma rukami za krk a začne neartikulovane kričať. Sestrička ho udrie lekárničkou po hlave a krik prestane. O 10 minút sa to zopakuje znovu. Keď sa to opakuje už šiesty krát, tak to pacient nevydrží a spýta sa lekára:\r\n- Prosím vás, myslíte, že dôjdeme v poriadku? Nemal by radšej šoférovať niekto iný?\r\nLekár mu na to odpovedá:\r\n- Ale kdeže, to je úplne v poriadku. Viete, sestričke sa včera obesil manžel a vodič si z nej robí iba srandu... ', 564, 3.52, 16),
	(1875, 'Ako spoznáte černobilského starca?\r\nPodľa protónového čísla.', 68, 3.34, 16),
	(1876, 'Dodi hovorí Lady Di:\r\n- Diana, poď som mnou na víkend do Paríža.\r\n- Nie Dodi, nechce sa mi.\r\n- Ale Diana, poď bude zábava.\r\n- Vieš Dodi, nemôžem, mám nejaké povinnosti v Londýne.\r\n- Diana, prosím ťa, poď som mnou, urobíme si skvelý víkend.\r\n- Naozaj sa mi Dodi nechce.\r\n- Diana, poď, jeden víkend v Paríži ťa predsa nezabije!', 349, 2.87, 16),
	(1877, 'Príde chlapík k lekárovi na vyšetrenie a pýta sa:\r\n"Pán doktor, koľko mi ešte zostáva času?"\r\n"Ešte takých desať."\r\n"Mesiacov, alebo rokov?"\r\n"Deväť, osem, sedem, šesť..."', 188, 3.17, 16),
	(1878, 'Čo urobíme ak nám malomocný podá ruku?\r\nVrátime mu ju.', 60, 3.35, 16),
	(1879, 'Zavolá chlapec do rádia a vraví:\r\n- Chcel by som dať zahrať pesničku od Petra Nagya pre môjho beznohého bratranca: Sám s nohami na stole.', 146, 3.33, 16),
	(1880, 'Dojde opitý bača-goral  na salaš a pomiluje ženu. Jeho žena mala menštruáciu.Bača sa ráno zobudí, nič si nepamätá a ide k ovciam. Cestou zbadá, že má zakrvavené ruky a hovorí:\r\n" Jo še bil."\r\nIde sa umyť a uvidí svoje zakrvavené ústa a povie:\r\n"Jo go zjod."', 280, 3.13, 16),
	(1881, 'Aké boli posledné slová kapitána Concordu, ktorý sa zrútil, pre cestujucich? \r\n\'Ešte vás hodím na hotel.\'', 114, 3.25, 16),
	(1882, 'V kanibalskej rodine:\r\nMuž: - Keď ja nemám tvoju mamu rád.\r\nŽena: - Dobre, tak jedz len zemiaky.', 101, 3.13, 16),
	(1883, 'Na lúke leží chlap, na chrbte má batoh a lietaju okolo muchy.\r\nČo má ten chlap v batohu?\r\nPadák.', 103, 3.44, 16),
	(1884, 'Koľko Černobyľcov je treba na zaskrutkovanie žiarovky?\r\nŽiadnych, ľudia čo svetielkujú nepotrebujú žiarovky.', 118, 3.06, 16),
	(1885, 'Rodičia kúpu deti Janka a Aničku. Zrazu sa Anička pýta otecka.\r\n"Oci a ja kedy budem mat medzi nohami to čo má Janíček."\r\n"Počkaj keď odíde mamička."', 162, 3.13, 16),
	(1886, 'Pacient :"Pán doktor, povedzte mi pravdu ! Zomieram ?"\r\nDoktor :"Pravdaže !"', 78, 3.13, 16),
	(1887, 'Stertnú sa dvaja priatelia a jeden sa pýta druhého :\r\n"Tak čo ako to ide ?"\r\n"Ale, včera mi ženu auto zrazilo."\r\n"Páni moji, a čo budeš teraz robiť ?"\r\n"Neviem, asi budem musieť jesť ryžu."', 202, 2.89, 16),
	(1888, 'Ide pedofil po lese a stretne malé dievčatko.\r\n- Čo sa ti stalo maličká, že tu tak plačeš?\r\n- Ocko sa mi obesil na strome, mamička ho išla dávať z neho dole, ale spadol na ňu konár a zabil ju. A keď to všetko videl brat, zobral pištoľ a zastrelil sestru a potom aj seba.\r\nPedofil si začne rozopínať nohavice a hovorí dievčatku: \r\n- Máš ty ale dnes blbý deň, čo?', 389, 3.17, 16),
	(1889, 'Janko nešpáraj sa starému otcovi v nose, lebo zavriem truhlu.', 64, 3.35, 16),
	(1890, 'Viete, aký je rozdiel medzi tehotnou Somálčankou a normálnou?\r\nTehotná vrhá tieň.', 88, 3.03, 16),
	(1891, 'Otecko je sám doma so synčekom:\r\n- Peťo, čo robíš?\r\n- Papám sekundové lepidielko.\r\n- Čooo ?!?!?\r\n- Hmmmmm hmm hmm.', 123, 2.99, 16),
	(1892, 'Aký je najlepší darček pre mŕtve dieťatko?\r\nMŕtve šteniatko.', 68, 2.81, 16),
	(1893, 'Chlap v krčme má pred sebou guláš a číta noviny. Noviny má pred sebou tak naširoko rozložené, že na ten guláš nevidí, čo využije prísediaci bezdomovec a šlohne mu celý tanier a začne jesť o dušu.Ako tak dojedá nájde na dne taniera hrebeň s chumáčom vlasov,nevydrží ten pohľaď natiahne ho a celý guláš vyvráti do taniera naspať. Chce ho vrátiť pred chlapa, lenže ako ho tam dáva drgne doňho.Chlap sa pozrie spoza novín a pýta sa:\r\n"Čo aj vy ste našli ten hrebeň?"', 508, 3.16, 16),
	(1894, 'Šli kolem dvje deti a chteli pochovat.\r\n"Tak jsen je pochoval" , praví hrobník.', 82, 3.02, 16),
	(1895, 'Rozhovor dvoch vodičov kamiónov:\r\n- Minule si frčím cez mesto a do cesty mi vbehne  malé decko. \r\n- A čo?\r\n- No nezabiješ ho?', 132, 3.28, 16),
	(1896, 'Vidíte príliš veľa svetla? Pichnite si s ihlou do oka.\r\nAk nedosiahnete žiadaný výsledok, akciu opakujte!', 112, 2.83, 16),
	(1897, 'Stojí chlapík pred pisoárom a má spustené ruky. Príde k nemu druhý a ten prvý ho požiada:\r\n"Mohli by ste mi rozopnúť nohavice a vytiahnuť ho?"\r\nZľutuje sa nad ním a urobí to. Potom ho požiada, či by mu ho mohol aj podržať. Urobí aj to. Aj dať naspäť a zapnúť nohavice. Urobí aj to. A napokon sa spýta:\r\n"Prosím Vás, máte niečo s rukami?"\r\n"Nie, ale keď mne sa ten syfilis tááák hnusí..."', 423, 3.97, 16),
	(1898, 'Janko sa pýta otecka:\r\n- Ocko, čo by sa stalo keby som sa nenarodil?\r\n- Uschol by si na perine.', 97, 3.99, 16),
	(1899, 'Ide matka s dieťaťom po ulici a zo zákruty sa zrazu sa vyrúti kamión, strhne dieťa a rozmetá ho po ulici. Matka celá vystrašená začne vrieskať. Šofér vystúpi z kamiónu, príde ku nej, a povie:\r\n"Blbé, čo?"', 223, 3, 16),
	(1900, 'Posledné slová pred smrťou:\r\n1. Posvieť mi tu s tým zapaľovačom, nech skontrolujem, koľko nafty je v nádrží.\r\n2. Tie schody v tomto starom majáku sú zachovalé.\r\n3. Chcem vystúpiť z Ál Kháidi.\r\n4. Ale nie, Yeti neexistuje.\r\n5. Neboj sa, mínu som už rozoberal 100-krát.', 288, 3.29, 16),
	(1901, 'Pri rieke sedí chlapček a plače. \r\n- Prečo plačeš? - pýta sa okoloidúci. \r\n- Lebo mi pred chviľou spadol do vody chlieb. \r\n- S maslom?\r\n- Nie, s bratom.', 161, 3.73, 16),
	(1902, 'S čím sa hrajú deti medzi koľajnicami?\r\nSo životom!', 56, 3.04, 16),
	(1903, 'Pýtajú sa mladého medika:\r\n- Tak čo, ako dopadla tvoja prvá operácia?\r\n- Operacia? Ja som si myslel, že to bola pitva!', 125, 3.29, 16),
	(1904, 'Viete čo najviac zaujíma nekrofilného zoofila?\r\nNo predsa, kde je ten pes zakopaný...', 89, 3.29, 16),
	(1905, 'Otecko príde domov a pýta sa Jožka:\r\n- Čo si dnes robil, synáčik?\r\n- Hral som s Ferkom futbal.\r\n- Ale Ferko nemá ani ručičky ani nožičky.\r\n- No futbal sa sním hrať dá!', 181, 3.25, 16),
	(1906, 'Stretnú sa dvaja:\r\n- Nazdar. Potreboval by som poradiť, ako sa mám zbaviť svojej starej.\r\n- Skús ju zastreliť.\r\n- To som už spravil. Ja sa ťa pýtam, ako sa jej mám zbaviť.', 182, 3.02, 16),
	(1907, 'Riaditeľ márnice hovorí svojej upratovačke:\r\n- Pani upratovačka, vy ste ako muška.\r\n- Čo, vari taká usilovná?\r\n- To nie, len lietate od jednej mrtvoly k druhej.', 169, 3.19, 16),
	(1908, 'Podľa čoho zistíš, že manželka je mŕtva?\r\nSex je ten istý, ale riady v kuchyni sa kopia.', 96, 3.1, 16),
	(1909, 'Vo vani sú dve anorektičky. Jedna hovorí druhej:\r\n- Drž sa, vypúšťam vodu.', 81, 3.3, 16),
	(1910, 'Chcel by som dať zahrať mojej kámoške, ktorá sa otrávila alkoholom, pesničku Sharry Sharry Lady.', 103, 2.94, 16),
	(1911, 'Doktor príde za pacientom po vážnej autonehode.\r\n"Mám pre Vás dve správy:Jednú dobrú a jednu zlú,ktorú chcete počuť prvú?"\r\n"Tú zlú."\r\n"Museli sme Vám amputovať jednu nohu."\r\n"Pane bože a tá dobrá?"\r\n"Máme na Vašu adidasku kupcu."', 252, 3.01, 16),
	(1912, 'Idú traja blázni po poli a nájdu mínu. Začnú si ju pohadzovať a zrazu im vybuchne. Jednému to odtrhne ruky, druhému nohy a tretiemu výbuch natrhne hubu od ucha k uchu. Ten, čo mu odtrhlo ruky príde k tomu čo mu natrhlo hubu a hovorí mu:\r\n" Tebe sa to kamárat ale smeje, ale nás to mohlo zabiť!"', 311, 3.13, 16),
	(1913, 'Príde týpek do reštiky a pýta si cubri cubri.Čašník na neho začudovane pozrie a odíde do kuchyne.\r\nOpýta sa kuchárky, čo je to cubri cubri. Ona nevie tiež a poradí mu, nech naští do pohára a nech mu to zanesie.Čašník tak urobí a zanesie to zákazníkovi.On to vypije a odíde.Na druhý deň príde zas a pýta si jedno cubri cubri.Čašník mu v kuchyni zase naští do pohára a donesie mu to.Týpek to zas vypije a odíde.Na tretí deň príde zase a pýta si jedno cubri cubri.Čašník odíde do kuchyne a hovorí kucharke, že mu netreba cikať, že nech tam naští ona. Kuchárka zoberie pohár, naští tam a ešte tam vymača svoju krvavú vložku.\r\nČašník to vezme zákaznikovi, on to vypije a hovorí:\r\n"Toto je cubri cubri a nie tie šťanky, čo ste mi nosili pred tým."', 808, 2.98, 16),
	(1914, 'Viete aký je rozdiel medzi pitbulom a mixérom?\r\nSkoro žiadny, ale mixér môžete vždy vypnúť.', 100, 3, 16),
	(1915, 'Z knihy Slovenské príslovia a porekadlá:\r\n"Ženu ani kvetinou neudrieš, kvetináčom ju dobiješ!"', 102, 3.17, 16),
	(1916, 'Prídu rodičia s malým dieťaťom k lekárovi. Dieťa má horúčku a už to s ním vyzerá bledo. Doktor vyberie injekciu a dieťa razom zaspí. Otec sa vraví:\r\n- To je užasné! Čo je to za zázračnú medicínu?\r\n- Aka medicína? Eutanázia!', 248, 2.76, 16),
