	(1925, 'Manželom sa narodí dieťa, no je to iba hlava.\r\nTak už po troch rokoch na vianoce sa hlava priplazí ku stromčeku, rozbalí svoj darček a hovorí:\r\n"Už tretie Vianoce a zasa čiapka!"', 189, 2.8, 16),
	(1926, 'Mladomanželia ležia v posteli vedľa seba, keď sa zrazu muž ozve: \r\n"Drahá, daj ruku pod paplón."\r\n"Áno drahý."\r\n""Cítiš aké je to dlhé? "\r\n"Áno drahý! "\r\n"Cítiš aké je to hrubé."\r\n"Áno drahý! "\r\n"A cítiš aké je to teplé? "\r\n"Áno drahý! "\r\n"Tak to som vysral ja sám a špeciálne pre teba!!!!"', 320, 2.86, 16),
