	(1928, 'Viete,prečo majú ženy nohy?\r\nAby za sebou nezanechávali mokré pásy, ako slimáky!', 87, 2.85, 16),
	(1929, '"Tomáš, zase sa hráš s vybrátorom."\r\n"Nie, to si iba čistím zadok..."', 76, 3, 16),
	(1930, 'Hovorí jedna mladá kočka druhej:\r\n- Staré babky z rodiny ma začali štvať tým, že mi na každej svadbe hovorili "Ty budeš ďalšia...".\r\nDruhá na to zvedavo:\r\n- A čo ty na to?\r\n- Začala som im robiť to isté, ale na pohreboch.', 239, 3.24, 16),
	(1931, 'Idú dvaja frajeri z humanitárnej pomoci zúboženou krajinou a vidia ako krokodíl žerie domorodca. Chvíľku na to tak pozerajú a jeden povie:\r\n- Tak mi im sem vozíme pomoc a oni si tu chrápu v spacákoch LaCosta! ', 221, 2.84, 16),
