	(1933, 'Učiteľka sa pýta detí:\r\n"Keby ste mali 10 SK, ako by ste vedeli najviac ušetriť?"\r\nPrihlási sa Anička:\r\n"Ja som si včera kúpila keks za 5 Sk a ešte mi 5 Sk zostalo."\r\nPrihlási sa Janko:\r\n"Ja som si kúpil včera za 2 Sk žuvačku a zostalo mi 8 Sk."\r\nV tom sa prihlási Móricko:\r\n"Ja som kúpil za 10Sk jaternicu. Najprv sa s ňou spravila mama, potom sestra, obsah sme zjedli na večeru, potom to otec použil ako prezervatív. Ráno sme sa do toho všetci vysrali a išli sme to mäsiarovi reklamovať. A tu je tých vašich 10 korún."', 551, 3.28, 16),
