	(1937, '- Mami, prečo zdobíš ten vianočný stromček už teraz v máji? \r\n- Vieš, lebo ty náš malý tuberáčik do vianoc asi nevydržíš.', 138, 2.88, 16),
	(1938, 'Ide muž na aute a zastaví stopárke. Keď ju zvezie, povie jej:\r\n"Zato že som ťa zviezol mi vyfajčíš!"\r\nOna povie že dobre a keď sú už pri tom on jej chce dopomôcť, chytí jej uši, aby dosiahol orgazmus. V tom sa ale nesústredí na cestu, narazí do stromu a keď sa preberie tak má v rukách jej uši. Vybehne von a začne sa pýtať ľudí či tu nevideli babu bez uší.\r\nNikto nič až jeden sa ozve:\r\n"Hej bola bez uší, ale vždy na mňa vyplazovala penis."', 480, 3.15, 16),
	(1939, 'Prečo majú sliepky perie?\r\nAby lepšie horeli.', 48, 2.75, 16),
	(1940, 'Vieš, kedy má žena najväčšiu dieru?\r\nKeď jej kopú hrob.', 63, 2.52, 16),
	(1941, '"Viete čo je najlenivejší tvor na svete?"\r\n"Penis, lebo vždy sedí, sem tam sa postaví a aj keď sa postaví opľuje majiteľa a sedí dalej."', 147, 2.89, 16),
	(1942, 'Brat súloží so sestrou a sestra hovorí:\r\n"Jano Ty miluješ lepšie, ako tatko."\r\n"Viem, aj mamka hovorila."', 111, 3.46, 16),
	(1943, 'Muž leží na smrtelnej posteli a zrazu cíti ako sa k nemu z kuchyne nesie vôňa čerstvých pagáčikov. Z posledných síl sa zosunie z postele a doplazí sa do kuchyne. Ako sa tak naťahuje po pagáčiku na sporáku, zbadá to žena, rýchlo priskočí, buchne ho po ruke a skríkne: \r\n- Necháš to, to je na kar!', 320, 3.34, 16),
	(1944, 'Jeden otec mal syna, ktorý strašne pil. Chcel ho nejako priviesť k rozumu  a stále mu dohováral: \r\n- Synak, mal by si prestať piť a začať si sporiť, založiť si rodinu. No, keby som tak umrel, veď ma nemáš ani začo pochovať!\r\nSyn tak rozmýšľa a potom hovorí: \r\n- Otec, a vieš čo by bolo najlepšie? Keby ťa niečo zožralo!', 346, 3.2, 16),
