	(1949, 'Príde chlapík k obvodnému lekárovi a ukazuje mu svoj opuchnutý pohlavný úd. Doktor si ho poobzerá a vraví: \r\n- To sa musí amputovať.\r\nPacientovi sa to nepáči, však je ešte mladý, tak navštívi lekára v okresnej nemocnici, tam majú lepších špecialistov. Diagnóza a riešenie problému je však rovnaké ako u obvoďáka, amputácia, tak sa rozhodne pre krajského špecialistu. Ten si pohlavný úd prezrie a takisto odporúča pacientovi amputáciu. Pacient sa však pohlavného údu v jeho veku nechce vzdať a tak odchádza smutný domov. Tam sa pošťažuje priateľovi a ten mu odporúča, aby navštívil babku zelinárku, vraj tá mu určite pomôže. Tak aj spraví, babka si pohlavný úd prezrie, namieša masť a podáva ju nešťastníkovi s odporúčaním, že si má penis netierať denne ráno aj večer. Pacient sa netešene pýta: \r\n- A netreba amputovať?\r\n- Netreba synak, netreba, on po týždni sám odpadne!', 951, 3.13, 16),
	(1950, 'Príde chlapík do špitála, lebo mu tam rodí žena. Doktor si ho odvedie stranou a povie.\r\n- Viete, mám pre Vás dve správy, jednu veselú a jednu smutnú. Ktorú chcete počuť ako prvú?\r\n- No, tú smutnú.\r\n- Viete, Vaša žena pri pôrode zomrela a ani dieťa sa nám nepodarilo zachrániť.\r\n- Aha, no a tá veselá?\r\n- Vidíte tamtú nádhernú sestričku? No tak s tou spávam.', 389, 3.1, 16),
	(1951, 'Má to dve nohy a veľmi to krváca. Čo je to? \r\nPolovička zo psa.', 68, 2.88, 16),
	(1952, 'Na ľade leží dieťa.\r\n- Pani to je vaše dieťa?\r\n- Áno\r\n- Bože veď prechladne!\r\n- Nebojte sa leží tam  už tri dni a ešte ani raz nekýchol.', 150, 3.72, 16),
