	(1957, 'Na frekventovanej križovatke v centre Bratislavy stoja chodci na prechode a čakajú, kým naskočí zelená. Potom pomaly a disciplinovane (ako je na Slovensku zvykom) prechádzajú cez cestu. V tom sa zprava priženie dvadsať tonový kamión a prejde v plnej rýchlosti cez cestu. Na zemi spúšť - mŕtvi a dokaličení ľudia, niektorí popristávali na stromoch. Malá Anička sa pozerá na otecka a mamičku, ktorí ležia na zemi a nejavia známky života. Len oteckovi sa z nosa valí krv. Nakloní sa k Jožkovi, svojmu bratovi, a pýta sa ho:\r\n- Čo teraz?\r\n- Teraz si dáme DELI.', 593, 3.22, 16),
	(1958, 'Aký nástroj použijeme na zväčšenie malého otvoru?\r\nPedofila.', 67, 3.01, 16),
