	(1975, 'Syn milionára má okrúkle narodeniny a otecko sa ho pýta:\r\n- Čo by si prial k narodeninám?\r\n- Ocino, ja mám všetko, ja už nič nepotrebujem. Helikoptéru mám, auto mám, vilu mám, jachtu mám... \r\n- Ale vieš predsa 20 narodeniny. Bude oslava a chcel by som ti niečo podarovať, čo by ťa potešilo.\r\nSyn rozmýšla a potom povie:\r\n- Ocino, chcel by som 10 mŕtvych černochov.\r\nJe oslava, otec zavolá syna a na strome vysí 10 černochov.\r\nSyn na nich pozerá a usmieva sa. \r\n- Synak, aha, ten na ľavo ešte dýcha, choď za ním, možno ti chce niečo\r\npovedať.\r\nSyn podíde k nemu, černoch si povoli slučku a začne:\r\n- Happy birthday to you.', 662, 2.82, 16),
