	(1978, 'Ide ožratý chlapík z krčmy a na rohu hodí "šabľu". Ihneď pribehne reportér a kričí do kamery:\r\n- Tak toto váš jogurt nedokáže!', 141, 3.08, 16),
	(1979, 'Spermie sa ponáhľajú k cieľu a hádajú sa:\r\n"Ja budem clapček!"\r\n"Ja budem dievčatko!"\r\n"Ja budem chlapček!"\r\n"Ja budem dievčatko!"\r\n"Držte huby, veď nevidíte, že sme v umývadle."', 193, 3.35, 16),
