	(1991, 'Príde novinár na salaš ku bačovi a pýta sa.\r\n- Pán bača, a vy športujete ???\r\n- No samozrejme, že hej. Veď ako ináč.\r\n- A aký šport trénujete ???\r\n- Žinčicu.', 174, 2.85, 16),
