	(1993, 'Mám krásne nové červené FERRARI. Štartujem, vychádzam z garáže, som na ceste, pridávam plyn, vchádzam na hlavnú, pridávam, idem najmenej dvesto, vidím kŕdel detí, zapínam stierače.', 198, 3.12, 16),
	(1994, 'Dievčatko sa hrá na dvore a zrazu kričí:\r\n"Mami, pes sa miluje!" \r\nMatka na to:\r\n"Tak si ho nevšímaj!"\r\n"Ale to bolí!"', 125, 3.01, 16),
	(1995, 'Vychádzam z verejného WC. Na zemi vidím tisíckorunáčku. Zohnem sa pre ňu, že si ju vezmem a zrazu zozadu cítim, že si na ňu práve zarábam...', 153, 3.44, 16),
	(1996, 'Aký je to človek, ktorý nemá oči?\r\nBezočivý.', 51, 3.25, 16),
	(1997, 'U lekára:\r\n- Pán doktor, koľko času mi ešte ostáva?\r\n- To vám presne neviem povedať, ale trvanlivé mlieko si už nekupujte.', 132, 3.47, 16),
	(1998, 'Príde starká do predajne s mäsom a pýta sa predavača :\r\n"Prosím vás,ten mozog je čerstvý?"\r\n"Že váhate", hovorí predavač, "ešte ráno lúštil krížovku!"', 169, 3.3, 16),
	(1999, 'Príde mladík na cintorín poliať babke hrob. Sledujú ho ďalší dvaja, z ktorých jeden hovorí tomu druhému: \r\n- Počúvaj Jano, načo ten mladík polieva ten hrob? Veď babenka mu aj tak nevyrastie.', 206, 2.8, 16),
	(2000, 'Viete, prečo posielajú starých ľudí do kúpeľov s liečivým bahnom?\r\nAby si postupne zvykali na pôdu.', 109, 3.08, 16),
	(2001, 'Kde väčšinou nájdeme chromého?\r\nTam, kde sme ho nechali.', 61, 3.18, 16),
	(2002, 'Je možné dať si kúpeľ ak máme hnačku?\r\nNo, áno, ak jej máte dosť.', 75, 3.06, 16),
	(2003, '- Danka, ty kojíš?\r\n- Nie, to si mi vycucol vriedok.', 54, 3.09, 16),
	(2004, 'Mama sa pýta Jožka:\r\n- Ako to, že si tu polievku ešte nezjedol?\r\nJožko na to:\r\n- Ale mami, tak mi chutila, že som si ju dal ešte raz!', 140, 2.69, 16),
	(2005, 'Vietnam 1967. Američan sa miluje s Vietnamkou. Vojde druhý Amík:\r\n- Nože daj, nech si aj ja niečo užijem.\r\n- Zmizni! Zastrel si svoju.', 140, 2.89, 16),
	(2006, 'Hanoi 1967. Dvaja Amíci sa rozprávajú.\r\n- Včera som sa miloval s krásnu Vietnamkou. Krásne dlhé nohy, jemná pokožka, fantastické prsia...\r\n- A vlasy? Aké mala vlasy?\r\n- Ani neviem. Nemala hlavu.', 205, 3.81, 16),
	(2007, 'Sú vianoce a deti dostávajú darčeky. Janka hovorí: \r\n- Ja som dostala veľa darčekov a ty iba jojo.\r\nA Tomáško jej odpovedá: \r\n- Niekto má jojo, niekto rakovinu.', 171, 2.98, 16),
	(2008, 'Mamička príde pred pôrodom k lekárovy na kontrolu či je dieťa zdravé.\r\n"Bude to krásny syn mamička."\r\n"Len aby bol zdravý."\r\nO dva dni neskôr.\r\n"Mamička váš synček nebude mať ručičky."\r\n"To nevadí,hlavná vec že bude zdravý."\r\n"no on nebude mat ani nozicky"\r\n"To nevadí,hlavná vec že bude zdravý."\r\nPo operácii donesú mamičke na tácke oko a mamička sa poteší\r\na začne sa s ním mazliť:"Puťuli,muťuli,cmuky,cmuk,ale je zlaté!"\r\nA doktor nato: " Netrápte sa,aj tak je slepé !"', 513, 2.83, 16),
	(2009, 'Deti sa v škôlke spokojne hrajú, iba Janko sedí v rohu, akoby niečo objímal. Učiteľka si to všimne a v domnení, že niečo skrýva ide za ním.\r\n- Janko, ukáž čo to tam máš!\r\nJanko sa na ňu pozrie a povie:\r\n- Detskú obrnu.', 239, 2.88, 16),
	(2010, '"Mami!?"\r\n"Ano?"\r\n"Prečo dedko tak kľučkuje?"\r\n"Drž hubu a nabíjaj!"', 73, 3, 16),
	(2011, 'Rozprávajú sa dvaja škótsky manželia:\r\n- Ten náš synček líže ten cukrík nejako dlho, Charles, nemyslíš? \r\n- Áno, máš pravdu, asi by sme mu ho mali odbaliť.', 172, 2.97, 16),
	(2012, 'Pri horiacom dome hovorí jeden druhému:\r\n"Cítim tu karamel."\r\n"Viem, môj dedo mal cukrovku."', 96, 3.04, 16),
	(2013, '"Jožko! Čo máš v tom batohu?"\r\n"Umelé srdce a pľúca."\r\n"A od koho to máš?"\r\n"Od otecka."\r\n"A čo ti povedal, keď ti to dával?"\r\n"Chrrrrrrr"', 150, 3.23, 16),
	(2014, '"Mami! Ale ja mam tak rada otecka."\r\n"No dobre. V chladničke máš ešte jeden kúsok."', 88, 3, 16),
	(2015, 'Keď vietnamske deti uvideli americké bombardéry tak od radosti rozhadzovali rukami nohami, niektoré až 50 metrov ďaleko.', 126, 3.01, 16),
	(2016, 'Prečo je Kennyho rodina tak chudobná?\r\nLebo stále platia za pohreby.', 71, 2.77, 16),
	(2017, 'Nemci naháňajú partizánov.Tí sa ukryjú do domčeka k babke a prosia ju, aby ich neprezradila za žiadnu cenu. Nemci prídu k babke a spytujú sa, kde sú partizáni.\r\n- Babka, ak nepovieš, odrežeme ti nohu! \r\n- Nepoviem!\r\nOdrezali jej.\r\n- Babka, ak nepovieš, odrežeme ti aj druhú!  \r\n- Nepoviem\r\nOdrezali jej aj druhú a odišli. Partizáni vychádzajú z domčeka, posledný sa otočí a vraví:\r\n- Vidíš vidíš babka, lož má krátke nohy.', 456, 3.52, 16),
	(2018, 'Rozdiel medzi pedagógom a pedofilom?\r\nPedofil detičky naozaj miluje.', 70, 3.12, 16),
	(2019, 'Mami, daj mi ešte jeden ten vynikajúci želatínový cukrík!\r\nKoľko krát ťi mám hovoriť, že otecko má len dve oči!? ', 127, 3, 16),
	(2020, '"Marienka, Marienka pozri čo mám." \r\nZúfale neartikulovane kričí malátne, spomalene pohybujúci sa Janíčko.\r\n"Čo Janíčko, čo máš?"\r\nPýta sa ničím neprekvapiteľná Marienka. A Janíčko slabomyseľne húžve zo seba slová:\r\n"No predsa obrnu!"', 260, 2.8, 16),
	(2021, 'Pedofil ťahá večer malé dievčatko do lesa:\r\n- Ujo, ja sa po tme v lese bojím!\r\n- Čo ty, ale aj pôjdem domov sám!', 121, 3.08, 16),
	(2022, 'Z malého Janka je iba hlava. Sú vianoce a Janko sa kotúľa smerom k vianočnému stromčeku. Chytí do úst svoj darček a zubami ho otvorí. Zbadá obsah a zarmútene hovorí:\r\n"Do čerta, zase čiapka."', 207, 2.76, 16),
	(2023, 'Novinárska anketa "Čo si myslíte o nadväzovaní milostných vzťahov na pracovisku? Pomáha to,škodí?"\r\n- Keď ja neviem - škriabe sa opýtaný za uchom - keď u nás sú všetky ženy také chladné.\r\n- A kde pracujete?\r\n- V márnici.', 242, 3.42, 16),
	(2024, 'Chlapík príde do bordelu a hneď zhurta spustí:\r\n- Chcem štíhlu blondínu, chladnú, čo toho veľa nenakecá.\r\n- Máte smolu - hovorí bordelmama - pred chvíľou ju odviezli do márnice.', 193, 2.95, 16),
	(2025, '"Ako sa dáva dieťa do mixéru?"\r\n"Predsa nohami napred."\r\n"A prečo?"\r\n"Aby si videl, ako sa tvári."', 103, 3.15, 16),
	(2026, 'Príde muž so ženou do obchodu a muž hovorí:\r\n- Dajte mi zelenú kravatu.\r\nŽena na to:\r\n- Ale drahý, čo si vojak alebo policajt?\r\n- Tak mi teda dajte modrú.\r\nŽena:\r\n- Ale čo si sa zbláznil? Veď modrá ti predsa nepristane.\r\nMuž vytiahne pištol, zastrelí manželku a hovorí:\r\n- Prosím, dajte mi čiernu.', 319, 3.39, 16),
	(2027, 'Žena sa vráti domov a nájde manžela obeseného na lustri. Vyčítavo sa naňho pozrie a vraví:\r\n- No teda, ty sa hojdáš na lustri a malého na kolotoč nezoberieš!', 171, 2.74, 16),
	(2028, 'Viete, aké sú posledné slová elektrikára pred smrťou?\r\n- V pohode chlapi, to je nulka! ', 93, 3.18, 16),
	(2029, 'Otec hovorí deťom:\r\n- Tak detičky, dnes sa našej Mici narodili malé mačiatka. A čo potrebujú mačiatka, keď sú ešte maličké? Teplo. A ako vzniká teplo? Topením. Takže vezmeme mačiatka a ideme ich topiť.', 220, 3.01, 16),
	(2030, '- Ahoj rádio. Zahrajte mojej sestre, ktorá pri výbuchu plynu utrpela popáleniny 3. stupňa pieseň od Lucie Bílej Plyn už syčí z trouby ven.', 148, 2.92, 16),
	(2031, 'Ide matka so synom okolo obchodu s bicyklami a syn vraví:\r\n"Maaamii kúp mi tento bicykel."\r\nMatka len stroho odvrkne:\r\n"Drž hubu aj tak máš rakovinu..."', 157, 2.96, 16),
	(2032, 'Vystrašená a uplakaná matka behá zbesilo po parku a hľadá svojho malého syna. Stretne okoloidúceho chlapíka a roztraseným hlasom sa ho pýta:\r\n"Náhodou ste nevideli malého blonďavého chlapčeka s peknými modrými očami?"\r\nOn siahne do vrecka a opýta sa:\r\n"S týmito?"', 284, 3.01, 16),
	(2033, 'Viete, kedy človek koná najväčšiu prácu?\r\nKeď sedí na záchode a fajčí.\r\nA prečo?\r\nLebo zároveň ťahá aj tlačí.', 127, 3.27, 16),
	(2034, '- Deti, prečo toľko prehadzujete ten piesok?\r\n- Hrali sme sa s dedkom na pohreb a teraz nevieme, kam sme ho zahrabali.', 120, 2.65, 16),
	(2035, 'Akú výhodu majú tehotné ženy?   \r\nAk stúpia na hrable, neudrú ich do čela.', 82, 3.07, 16),
	(2036, 'Neznámy chlapík klope pri dverách:\r\n- Nebojte sa. Len sa vyseriem a idem preč!', 82, 2.86, 16),
	(2037, 'Posledné slová pred smrťou:\r\n- Toto lano udrží aj slona.\r\n- Brzdy sú hotové, poďme to odskúšať.\r\n- Miláčik, dnes môžeš šoférovať.\r\n- Tento granát je len atrapa.\r\n- Cez Luník IX je to skratka.\r\n- Pozri, užovka.\r\n- Nebojte sa, ten pes nehryzie.\r\n- Miláčik, naber mi ešte raz tej hubovej polievky.\r\n- Pozri sa, tá zbraň nie je nabitá.\r\n- Z prava nič nejde.', 382, 3.52, 16),
	(2038, 'Miluje sa žena trpiaca na AIDS a malomocný.\r\nPo sexe hovorí žena mužovi:\r\n- Musím sa ti s niečím priznať, mám AIDS.\r\n- Ako dobre, že mi vo vnútri odpadol.', 166, 3.24, 16),
	(2039, 'Kúpil som si andulku,\r\ndostal som aj škatuľku,\r\nnemá diery škatuľka,\r\ntak mi zdochla, andulka.', 100, 3.18, 16),
	(2040, '- Mama, bolí ma hlava!\r\n- Mňa keď bolí zub, dám si ho vytrhnúť.', 70, 2.99, 16),
	(2041, 'Príde starý Fero do krčmy a hovorí:\r\n- Chlapi, oslavujeme, narodil sa mi syn.\r\n- Vážne?! A ako sa volá?\r\n- Volá sa FeroDigital.\r\n- A prečo také čudne meno?\r\n- No Fero po mne a digital preto, lebo nemá ručičky.', 223, 3.15, 16),
	(2042, 'Malý cigán vojde do drogérie a pýta si žuvačku. Predavač mu omylom predá petardu. Zistí svoj omyl a vybehne na ulicu\r\n- Heej, počkaj ty!\r\nCigán sa otočí a PUKNE od smiechu.', 185, 3.24, 16),
	(2043, 'Vianoce v osobitnej škole. Príde dedo mráz a vraví:\r\n- Kto povie krátku básničku, dostane malý darček. Kto povie dlhú, veľký.\r\nPríde prvý chlapček:\r\n- Hemdee chrrr aa...\r\nDedo mráz: \r\n- A kto si bude zo mňa strielať nedostane nič.', 249, 2.93, 16),
	(2044, 'Bavia sa dvaja epileptici:\r\n- Počul som, že si včera v bare vyhral súťaž breakdance.\r\n- Hej, ale chcel som len objednať colu.', 132, 3.91, 16),
	(2045, 'Telefonát medzi dvoma krematóriami v meste.\r\n- Počuj, poraď. Mám tu liliputána a furt mi prepadne cez rošt.\r\n- Pošli ho ku mne. Zapálim ho vo fajke.', 157, 3.05, 16),
	(2046, 'MHD je ako smrť.\r\nNikdy nevieš, kedy pride.', 45, 3.39, 16),
	(2047, 'Ide vozíčkar cez železničné priecestie a zasekne sa medzi kolajnicami. Máva rukami a kričí na plné hrdlo, lebo vlak sa rúti plnou rýchlosťou. Vtom vybehne vrátnik, pozrie na vozíčkara a kričí na kolegu. \r\n- Fero, poď sa pozrieť, to bude šupa!', 262, 3.25, 16),
	(2048, '- Pane, čo to robíte s tým psom a sekerou?\r\n- Psie kusy.', 59, 3.05, 16),
	(2049, '- Dal som utratiť svoho psa.\r\n- Bol besný?\r\n- No, neskákal od radosti...', 75, 3.24, 16),
	(2050, 'Viete, ako sa delia politici?\r\nNajlepšie sekerou.', 50, 3.01, 16),
	(2051, 'Viete kto bol prvý český kozmonaut?\r\nNo predsa Ján Hus, len pri štarte zhorel.', 83, 3.24, 16),
	(2052, 'Otec hovorí svojim deťom:\r\n- Keď som bol malý, boli sme takí chudobní, že na Štedrý večer otec vybehol s puškou von, trikrát vystrelil, a keď sa vrátil povedal: "Darčeky nebudú, lebo Dedo Mráz spáchal samovraždu."  ', 234, 3.15, 16),
	(2053, 'Poslucháč:\r\n- Dobrý deň, chcel by som dať zahrať môjmu kamarátovi, ktorý má AIDS pieseň "Lietam v tom tiež".', 120, 3.18, 16),
	(2054, 'Chlapík sedí v nemocnici pred operačnou sálou. Zo sály vyjde doktor po ťažkej, päťhodinovej operácii a hovorí:\r\n- Viete, operácia dopadla v podstate dobre, ale vaša žena upadla do kómy. Viete, s tým súvisí veľa starostí. Budete ju musieť prevracať kvôli preležaninám, vymieňať plienky, dávať infúzie a lieky.\r\nChlapík si tak pomyslí: "Sakra, som v najlepších rokoch a teraz sa o ňu starať."\r\nDoktor po chvíli:\r\n- Ale nie, srandujem, umrela!', 477, 3.41, 16),
	(2055, 'Ahoj rádio, zahrajte mojej sestre, ktorá pri výbuchu plynu utrpela popáleniny III. stupňa pieseň od Pavla Vítka: Mám rád vúni tvý kůže.', 148, 3.3, 16),
	(2056, 'Kráča si tak jeden misionár po hladovej osade v Afrike. V jednej ruke chutná bageta a v druhej drží pol litra Coca-coly. Ide okolo malého chlapčeka s nafúknutým bruškom, trčiacimi lícnymi kosťami, ktorý so slzami v očiach a s nádejou hľadí na prvé ozajstné jedlo v živote v rukách služobníka božieho. Misionár na neho pozrie, s chuťou si odhryzne z bagety a povie:\r\n- Oči by jedli, že?', 415, 2.88, 16),
	(2057, 'Idú dvaja malomocní po ulici s jeden sa pýta druhého:\r\n- Ktovie čo nám dnes odpadne?', 90, 2.99, 16),
	(2058, 'Matka stopuje s malým dieťaťom na dialnici. Kamión v 150-ke zrazí dieťa. Matka strašne plače a kričí:\r\n- To nieeee, moje dieťa, nieeeee!!! Prečooo??!!!\r\nŠofér kamiónu vystúpi a hovorí:\r\n- Blbé, čo?', 216, 2.53, 16),
	(2059, 'Ako zvádza malomocné dievča chlapca?\r\nHádže po ňom oči!', 62, 3.15, 16),
	(2060, 'Chcel by som zomrieť ako môj starý otec: v spánku, tichosti, bez starostí a nie revúc, kričiac v panike tak, ako jeho cestujúci.              ', 150, 4, 16),
	(2061, '11. božie prikázanie:\r\nCti syna svojho, aby ťa nevyhodil z domu tvojho              ', 87, 4, 16),
	(2062, 'V chudobnej dedine, kde nemajú čo jesť, sa rozprávajú dvaja chlapi.\r\n- Čo robíš?\r\n- Hovno!\r\n- A kde na to berieš materiál?              ', 146, 4, 16),
	(2063, 'Príde chlapík do drogérie a žiada si čierny prezervatív.\r\n- Prečo práve čierny? - nechápe predavačka.\r\n- Ale, zomrel môj najlepší priateľ a chcel by som prejaviť sústrasť jeho manželke.              ', 218, 3.13, 16),
	(2064, 'Čo je s Ferom, dlho som ho nevidel.\r\n-Otvoril si obchod.\r\n-Naozaj? A s čím?\r\n-So železnou tyčou.              ', 115, 3.43, 16),
	(2065, 'Marienka sa pýta svojej smutnej priateľky:\r\n"Anička, čo máš na srdiečku?"\r\n"Strojček."              ', 108, 3, 16),
	(2066, 'V hoteli visí tabuľka \r\ns upozornením:\r\n"Nefajčite v posteli! \r\nPopol, ktorý tu zostane, môže byť váš vlastný."              ', 136, 3.67, 16),
	(2067, '"Slečna, to ste tak krásne štíhla po matke?"\r\n"Nie, po tuberkulóze."              ', 87, 3.25, 16),
	(2068, 'Volá 14-ročný chlapec do rádia:\r\n"Mohli by ste zahrať pre moju mladšiu ségru, ktorú včera znásilnili v parku, pesničku od Oľgy Záblackej - Prvé milovanie."              ', 183, 3.73, 16),
	(2069, 'Viete na čo umrel Hitler?\r\nPrišla mu faktúra za plyn.              ', 70, 3.55, 16),
	(2070, 'Zomrú fajčiar, homosexuál a alkoholik. Boh im dal druhú šancu, pod  jednou podmienkou, že nebudú robiť čo doteraz. Dobre priali to. Alkoholik vidí nedopitú fľašu a napije sa a zomrel. Zostali už iba fejčiar a homosexuál. Ako tak idú fajčiar uvidí nedofajčení špačok. Homosexuál mu vraví: "Ak sa zohneš zomriame odidvaja."              ', 361, 3.56, 16),
	(2071, 'Príde manžel domov a nadšene oznamuje žene:\r\n"Vyhrali sme milióny v športke!!"\r\nManželkou to ani nehne a zasnene sa pozerá z okna. Manžel opakuje:\r\n"Vyhrali sme fúru peňazí, ty nemáš radosť?"\r\nŽena sa otočí a hovorí:\r\n"Umrela mi matka."\r\nManžel na to pre seba:\r\n"Keď sa darí, tak sa darí!              ', 325, 4, 16),
	(2072, '"Čím bol váš otec?"\r\n"Tuberákom."\r\n"Nie, nie, ja myslím, čo robil?"\r\n"No, kašľal."\r\n"Ale veď z toho predsa nemohol vyžiť!"\r\n"Však aj zomrel."              ', 168, 4.17, 16),
	(2073, 'Pýta sa jedna mŕtvola druhej: Už týždeň sa somnou  nerozprávaš. Čo ťa niečo žerie?              ', 108, 3.5, 16),
	(2074, 'Kovboji krotili divé mustangy. Jeden z nich bol zvlášť ohnivý a každého zhodil na zem po pár sekundách. Až sa medzi divákmi objavil jeden starší pán, že by to tiež rád skúsil. Udržal sa celých 10 minút, potom kôň padol vyčerpaný na zem.\r\n"Ako sa vám to podarilo?"\r\n"Už 30 rokov denne súložím so svojou epileptickou manželkou."\n', 358, 3.21, 16),
	(2075, 'Robotník padá z lešenia. Dobrý kamarát naňho kričí:\r\n"Fero, daj si ruky von z vreciek, aby to vypadalo ako pracovný úraz".              ', 146, 3.94, 16),
	(2076, 'Čo treba urobiť, keď vám malomocný podá ruku?\r\nVrátiť mu ju!              ', 82, 3.24, 16),
	(2077, 'Čo máme robiť, keď dostane epileptik vo vani plnej vody záchvat?\r\nRýchlo tam hodíme špinavé prádlo!\n', 110, 3.69, 16),
	(2078, 'Viete, ako riadia auto slepci?\r\nPoložia pravú ruku na volant a ľavú na stredovú čiaru!              ', 106, 3.19, 16),
	(2079, 'Zazvoní Cigán na Vianoce pri dverách:\r\n"Nevezmete si dieťa? My ich máme dosť."\r\nRodina si to dieťa zoberie. Situácia sa opakuje aj na ďalšie Vianoce a keď už Cigán zazvoní aj ďalší rok, tak pán domáci pokrúti hlavou a povie:\r\n" Nie, nie my sme sa už rozhodli, tieto Vianoce budeme mať kapra..."              ', 330, 3.94, 16),
	(2080, 'Viete, prečo Marika Gombitová v poslednom čase nekoncertovala?\r\nPretože neprešla cez STK-čku.              ', 113, 3.53, 16),
	(2081, 'Je to na strome a nedýcha to. Čo je to?\r\nVrana v sáčku.              ', 73, 3.66, 16),
	(2082, 'Chlapíkovi zomrela manželka, no on až neskôr zavolá doktora. Doktor mu hovorí:\r\n"Preboha, človeče, prečo ste ma nezavolali skôr? Azda vám nehovorila, že jej je zle?"\r\n"No hej, čo by nehovorila, ale tak som si pomyslel, komu je dnes dobre?"              ', 266, 3.67, 16),
	(2083, 'Leží muž na smrteľnej posteli a zacíti omamnú vôňu pagáčikov. horko, ťažko sa postavi z postele, dotrepe sa do kuchyne a načahuje sa za jedným pagáčikom. v tom ho žena treskne s novinami po ruke a hovorí: "necháš to, to je na kar!"              ', 265, 2.9, 16),
	(2084, 'Poriadok musí byť, povedala babka a kopla hovno pod posteľ.              ', 76, 3.94, 16),
	(2085, 'Michael Jackson ide navštíviť svoju novú priateľku v pôrodnici, kde práve porodila ich dalšie dieťa. Keď príde doktor Jackson sa ho spýta:\r\n- Pán doktor a kedy môžeme začať so sexom?\r\n- Preboha, Michael, počkajte aspoň kým začne chodiť!              ', 272, 3.94, 16),
	(2086, 'Mamička kope svoje dietatko dole schodmy a v tom vyjde suseda na chodbu:\r\n- Preboha čo to robíte? veď mu spadne čiapočka!\r\n- Len sa nebojte on ju ma priklincovanú!              ', 184, 3.1, 16),
	(2087, 'Vojde hrbatý do obchodu a predavač sa ho pýta: "A čo sa pán tak potajme zakráda?!"              ', 102, 3.88, 16),
	(2088, 'Rozprávajú sa dve mamičky o svojich deťoch.\r\n- A ako sa volá tvoj synček?\r\n- Digitálky.\r\n- A prečo?\r\n- Narodil sa bez ručičiek.              ', 151, 3.4, 16),
	(2089, 'Stretnú sa dvaja typci:\r\n- Môj dedko zomrel v koncentračnom tábore.\r\n- No to je smutne.\r\n- To je, spadol zo strážnej veže.              ', 143, 3.56, 16),
	(2090, 'Ďakujeme našej firme za to, ako nás platí. Zachránila nám tým život. Veď čo keby sme dovolenkovali na Srí Lanke?              ', 137, 4.09, 16),
	(2091, 'Doopatrujem starých ľudí. \r\nZn. V rekordne krátkom čase.              ', 75, 4.17, 16),
	(2092, 'Prečo nemajú na onkológii budíky?\r\nA na čo?              ', 62, 2.71, 16),
	(2093, 'Čo má mať správny hypochonder na náhrobku?\r\nJa som vám to hovoril...              ', 88, 4.04, 16),
	(2094, '- Mamička, idem si s jankom zahrať futbal.\r\n- Ale veď on nemá ani nožičky ani ručičky.\r\n- To nevadí, on bude lopta!              ', 138, 3.86, 16),
	(2095, 'Viete čo je najhoršie pre narkomana?\r\nPlastová lyžička              ', 73, 3.5, 16),
	(2096, 'Nováka klepne v krčme pepka a kamoši nevedia, ako to povedať jeho manželke. Nakoniec tam jeden zájde:\r\n"Viete, pani Nováková, váš manžel bol v krčme a trochu sa opil."\r\n"Ako ho poznám, zase hral karty."\r\n"Nó, trochu si zahral."\r\n"To určite zase prehral kopu peňazí."\r\n"Nó, asi tak tri tisícky."\r\n"Šľak aby ho trafil!"\r\n"Však to aj urobil, madam."              ', 382, 3.87, 16),
	(2097, 'Lekár sa pýta pacienta:\r\n- Vy ste tu s tou rakovinou?\r\n- Nie, manželku som nechal doma.\n', 91, 4, 16),
	(2098, '- Môj brat je zápasníkom v Bratislave.\r\n- A s kým zápasí?\r\n- So smrťou.\n', 79, 3, 16),
	(2099, 'Aký je rozdiel medzi hnačkou a smrťou? \r\nŽiadny. Príde a musíš ísť.              ', 90, 3.31, 16),
	(2100, 'Príde pani s dieťaťom k doktorovi. Ten dieťa prehliadne a potom hovorí matke: "Vyzlečte sa..." Matka zdesene hovorí: "Prečo? Choré je dieťa, nie ja!!!" Doktor: "Toto už nezachránime, urobím vám nové..."              ', 231, 3.44, 16),
	(2101, '"Čo treba urobiť keď vybuchne atómová bomba?"\r\n"Treba sa vykúpať, zabaliť do bielej plachty a pomaly ísť na cintorín."\r\n"Prečo pomaly?"\r\n"Aby nevznikla panika."              ', 186, 2.45, 16),
	(2102, 'Aké sú prvé príznaky AIDS? \r\nTlak v oblasti konečníka a pocit horúceho dychu na chrbte.              ', 108, 3.67, 16),
	(2103, 'Janko, Jožko a Dežko sa pretekajú, kto je odvážnejší. Dohodli sa, že skúška odvahy bude mať dve časti: najprv musia podať ruku medveďovi a potom sa vyspať so svojou ženou.\r\nPrvý ide Janko, vbehne do jaskyne za medveďom a keď sa vráti, je taký otrasený, že už nie je ničoho schopný. Druhý ide Jožko a dopadne rovnako ako Janko. Tretí ide Dežko. Ostatní dvaja na neho čakajú \r\na Dežka nikde. Po pol hodine vybehne aj on. „Čo si tam tak dlho robil?“ pýtajú sa tí dvaja. \r\n„Bola tam strašná tma“, hovorí Dežko  \r\n„a s kým si to mám vlastne podať ruku?“              ', 619, 3.5, 16),
	(2105, 'Jožko utrpí na stavbe ťažkú nehodu, pri ktorej príde o obe uši. Keď sa má vrátiť \r\nz nemocnice, majster všetkých zvolá \r\na upozorňuje ich, aby boli na Jožka dobrí, že to ťažko nesie, aby mu to nepripomínali. Jožko je prvý deň zase v práci. Jeden kolega nevie o čom s ním má hovoriť a tak nadhodí: \r\n"Pozerám, že sa ti zlepšil zrak, čo?" \r\n"Áno? Prečo si to myslíš?" \r\n"No, že už nenosíš okuliare..."              ', 455, 3.75, 16),
	(2106, 'Vyjde muž z latríny a stretne kamaráta. \r\n„Ty, počuj, prečo máš taký sajrat okolo úst?“ \r\n„Ale, vypadla mi do latríny zubná protéza.“ „A čo, našiel si ju?“ \r\n„Vyskúšal som ich päť a ani jedna mi nepasovala.“              ', 255, 3.67, 16),
	(2107, 'Stretla sa raz tvár so zadkom a pýta sa:\r\n"Zadok, ako je to možné, že na mne sa tak prejavujú roky, som stále starší \r\na vráskavejší, ale ty si stále taký ružovučký \r\na hladký?"\r\n"To máš tak, milá tvár", odpovedá zadok. "Keď je veselo, ty sa smeješ. Keď je smutno, ty sa mračíš. Zatiaľ čo ja vždy len na všetko seriem."               ', 367, 4, 16),
	(2108, 'Rozprávajú sa dvaja chlapci:\r\n"Môj dedko bol hrdina."\r\n"Môj tiež."\r\n"A môj dedko bojoval na Dukle."\r\n"Aj môj."\r\n"A ako sa volal?"\r\n"SS gruppenführer Otto \r\nvon Heslich."              ', 191, 3.75, 16),
	(2109, 'Radí sa gazda s gazdinou: \r\n"Ten náš baran je akýsi smutný. Nemal by som ho zarezať?" \r\n"No keď myslíš, že ho to rozveselí..."               ', 152, 3.98, 16),
	(2110, 'Chromý vraví slepemu:\r\nJa ta kopnem.\r\nSlepí na to:\r\nTo chcem vidieť!              ', 86, 3.75, 16),
	(2111, 'Prečo má smrtka kosu?!\r\nLebo nemá papiere na kombain!              ', 70, 3.33, 16),
	(2112, 'Cigáň Jožko príde prvý deň zo školy a vravy:\n- ocko, pri telesnej som si všimol, že mam najväčšieho pipíka, ale  prečo? \n- nečuduj sa, veď máš už 17.\n', 169, 3, 16),
	(2113, 'Príde Cigán na úrad práce a hovorí úradníkovi: "Nemáte pre mňa nejakú robotu? Už sa mi nechce váľať doma a žiť len z podpory \na sociálneho. Chcel by som byť nejako nášmu štátu na osoh!"\nÚradník pozrie do počítača a hovorí:\n"Máte šťastie, práve dnes ráno sa uvoľnilo jedno  miesto. Jedna mladá, štíhla, krásna dáma potrebuje spoločnosť, bolo by to na celý rok, musíte ale s ňou chodiť aj na dovolenky \na zaručiť sa, že ju aspoň raz za deň pretiahnete. Nakoľko budete mať naozaj veľa práce, váš plat by bol cca. 2 milióny ročne." \nCigán sa na neho neveriacky pozrie a hovorí:  "Hej Gádžo, robíš si zo mňa srandu?" \nNa to úradník: "A kto s tým začal?!"              ', 732, 4.25, 16),
	(2114, 'V meste sa rozmnožili holuby, všetko bolo osraté. Starosta vypísal konkurz, mesto vraj zaplatí milión tomu, kto ho zbaví holubov. Prihlásil sa jeden a hovorí:\n"Zbavím vás holubov zadarmo, ale nesmiete mi klásť žiadne otázky."\nVytiahol z vrecka žltého holuba, vypustil ho \na všetci holuby z mesta leteli za ním, nevedno kam. Starosta hovorí:\n"Ja viem, že nás to bude stáť milión, ale, nemáte aj žltého Cigána?"              ', 452, 4.12, 16),
	(2115, 'Babka výhra prvú cenu v športke. Zbehnú sa novinári a pýtajú sa: Babka, čo si kúpite za tie milióny? Babka odpovedá: Dom, auto a dám postaviť veľký pomník Hitlerovi. Novinári: Babka, veď to bol najväčší netvor. Babka pozrie na tetovanie na ruke a povie: Ale čísla mi vyšli.              ', 312, 3.55, 16),
	(2116, '"Milé bravíčko, som 15 ročná Cigánka a ešte nie som tehotná, nie je môj otec homosexuál?"              ', 113, 3.33, 16),
	(2117, 'Rozprávajú sa dve kamarátky: \n"Poviem ti, mám perfektného manžela. Každý večer je doma, nebehá za inými, proste pohoda." \n"No, tak to máš ale dokonalé manželstvo..." \n"To zase nie, on má obrnu."               ', 225, 3.5, 16),
	(2118, 'Peťko v obchode so zvieratkami:\n"Včera som si u vás kúpil morské prasiatko. Doma som ho pustil do akvária so slanou vodou. Ono sa tam chvíľu radostne čľupkalo, potom si ľahlo na dno a zaspalo. Chcem sa spýtať kedy sa prebudí a čo mu mám potom dať žrať...?"              ', 289, 3.3, 16),
	(2119, 'Ak máš nádhernú manželku, očarujúcu milenku, ak vlastníš skvelé auto, ak nemáš problémy \ns daňovým úradom, ak vždy, keď vyjdeš na ulicu svieti na teba jasné slnko a ľudia sa na teba usmievajú... je čas skončiť s narkotikami.              ', 263, 4.19, 16),
	(2120, 'Čo máme robiť, keď dostane epileptik vo vani plnej vody záchvat?\nRýchlo tam hodíme špinavé prádlo.              ', 122, 3.11, 16),
	(2121, 'Mami, ocko sa nám obesil na povale.\nJežišmária!\nPrvý apríl! V pivnici...              ', 92, 4.01, 16),
	(2122, 'Pred súdom:\n- Človeče\n- rozčuľuje sa sudca\n- to už je váš dvadsiaty pokus o znásilnenie!\nSom zvedavý, kedy sa vám to konečne podarí...              ', 161, 3.92, 16),
	(2123, 'Beži Jožko do kuchyne a kričí:,,Mami, mami ocko spadol v zahrade zo stromu!"Mama sa ho píta:,,A poranil sa?" Nie našťastie si okolo krku priviazal špagat.              ', 176, 3.33, 16),
	(2124, 'Viete preco slepy nemoze skakat bungee-jumping?\nLebo by sa mu pogrcal pes!              ', 88, 3.86, 16),
	(2125, 'Vieš kde sú najlepšie tanečnice?\nV Al Kaide. Vedia tancovať do roztrhania tela.              ', 98, 3.38, 16),
	(2126, 'Idú dvaja malomocní po ulici a stretnú známeho. Ten známy ich pozdraví. Jeden malomocný odpovie a tomu druhému odpadne kúsok mäsa. Ten, čo odpovedal na pozdrav toho druhého pokára:\n"To si celý ty. Miesto, aby si pozdravil, tak zase len niečo utrúsiš."              ', 282, 3.17, 16),
	(2127, 'Výkrik z márnice: "Drahá, prečo si ku mne taká chladná?"              ', 76, 3.75, 16),
	(2128, 'Bavia sa dvaja: "Na čo vlastne zemrela tá tvoja manželka?"\n"Čo ti ja viem" hovorí druhý "ja ti vlastne ani neviem na čo žila..."              ', 150, 3.5, 16),
	(2129, '”Môžete nám vysvetliť, ako k tej nehode došlo?”\r\n”Lúpal som si jablko a kúsok šupky mi spadol na zem. Šla okolo svokra, šmykla sa na nej, padla mi na nôž a to sa stalo osemkrát!”\n', 200, 3.9, 16),
	(2130, 'Istý lekár z patológie sa rozhodne zavolať do predajne motocyklov...\r\n"Dobrý deň, tu patológia, prosím Vás, koľko ste dnes predali tých nových motoriek?"\r\n"No, presne 20. Prečo?"\r\n"Tak to by som rád vedel, kde sa tí traja ešte flákajú..."              ', 270, 3.88, 16),
	(2131, 'Vykukne krokodíl z vody na rybára a pýta sa ho:\r\n”Berú, berú?”\r\n”Kdeže, ani ťuk...”\r\n”Tak sa na ne vykašli a poď sa vykúpať.”\n', 149, 3.81, 16),
	(2132, 'Ako sa dávajú detičky do mixéra? Nožičkami napred, aby sme videli ako sa tvária.              ', 101, 3.55, 16),
	(2133, 'Kraľ vyhlásil súťaž: Kto, zostrelí jablko princezninej hlavy, tak toho ženou sa stane.\r\nPríde prvý, zostrelí jablko z hlavy\r\na povie: "I\'m Robin Hood."\r\nPríde druhý, zostrelí jablko z hlavy a povie: "I\'m Wiliem Tell."\r\nPríde tretí, zostrelí princeznej oko a povie: "I\'m sorry!"              ', 307, 4.27, 16),
	(2134, 'Rušňovodičovi:\r\n”Preboha, ako ste to išli s tým vlakom, keď ste sa s nim vykoľajili do kukurice?”\r\n”Ale, normálne som išiel po koľajách a zrazu vidím rovno na prostriedku Rusa.”\r\n”Tak ste ho mali zraziť!”\r\n”Veď som chcel, ale ušiel mi do kukurice!”              ', 293, 3.4, 16),
	(2135, '”Čo si robil cez prázdniny Jožko?”\r\n”Bol som pri mori s maminkou a jej novým priateľom.”\r\n”A čo, páčilo sa ti? Skamarátil si sa s novým ujom?”\r\n”On je super kamoš! Každé ráno ma brával loďkou päť míl od pláže a ja som vždy potom plával k brehu.”\r\n”A vládal si toľko plávať?”\r\n”Plávanie bolo fajn, ale najhoršie bolo vymotať sa z toho vreca.”               ', 410, 4.24, 16),
	(2136, '”Novák, vyzeráš hrozne. Čo je s tebou? Nebol si toho roku na dovolenke?”\r\n”Veď práve, bol...”\r\n”A kde si ju strávil?”\r\n”Dva dni v aute na dne priepasti a potom dva mesiace v nemocnici...”              ', 224, 3.94, 16),
	(2137, 'V lietadle letuška: \r\n”Nie je medzi cestujúcimi lekár?”\r\nJeden z cestujúcich sa postaví a ide do pilotnej kabíny. Za chvíľu vyjde a pýta sa:\r\n”Nie je medzi cestujúcimi pilot?”               ', 208, 3.7, 16),
	(2138, '"Conrad, ty dovolíš Patrickovi fajčiť!? Však mu bude zle!!!\r\nŠkoda tých peňazí za cigarety!"\r\n"Ale nebude tri dni nič jesť!"              ', 149, 4, 16),
	(2139, 'Viete ako sa lieči AIDS v Rusku?\r\nAkupunktúrov: na tele sa nájdu tri body a potom poriadne zatlačíte vidlami.              ', 128, 3.67, 16),
	(2140, 'Zahrajte prosím Vás mojmu synovi,  ktorému guľka prestrelila hlavu pesníčku od Sugababes "Hole in the head".              ', 128, 3.91, 16),
	(2141, 'Posledné slová pred smrťou: Šak ja som len srandoval.              ', 71, 3.44, 16),
	(2142, 'Stretnú sa dvaja kamaráti a jeden hovorí druhému:\r\n"Moja žena je anjel."\r\nDruhý odpovedá:\r\n"To máš ale šťastie, moja ešte žije."              ', 155, 3.75, 16),
	(2143, 'Lietadlo havarovalo a vyletel z neho cestujúci. Preto začal vzývať svätého Františka, aby mu pomohol. Odrazu padne Františkovi do náručia a ten sa ho pýta: "Ktorého Františka si vzýval?".\r\n-"Assiskeho." \r\n-"Tak ja som Salesky." a pustil ho.              ', 268, 3.6, 16),
	(2144, '-Dobrý deň. Peťo je doma?\r\n-Zatiaľ hej, ale vence už odniesli.              ', 81, 3.4, 16),
	(2145, 'Policajt príde do práce a naradostene volá:\r\n"Kolegovia, narodil sa mi syn!"\r\n"To je skvelé a ako sa volá?" vyzvedajú kolegovia.\r\n"Jožo Digitál." vraví čerstvý otec.\r\n"To je divné meno, prečo ste ho takto pomenovali?"\r\n"Jožo po mne a Digitál, lebo sa narodil bez ručičiek."              ', 304, 3.2, 16),
	(2146, 'Policajná hliadka zastaví auto: \r\n"Pán vodič, čože to máte so zadnými svetlami?"\r\nVodič vystúpi, prejde za auto a začne zúfalo lamentovať. \r\n"No, len pokojne, pokojne, veď nič také strašné sa nestalo," upokojuje ho hliadka, "my sme sa pýtali len na svetlá..."\r\n"Čo tam po zadných svetlách, ale kde mám príves so ženou a deťmi?"              ', 368, 3.91, 16),
	(2147, 'Mami našiel som otecka! \r\nKoľko rázy ti mám hovoriť, že nemáš kopať na tej záhrade!              ', 107, 4, 16),
	(2148, 'Domovník vidí susedu ako kope svojho syna dolu schodmi a zhrozene sa pýta:"pane Bože pani Boženka, prečo kopete to dieťa?\r\nVeď ho to musí bolieť!" \r\n- Pani Božena v klude odpovedá: "nerobte si starosti pán sused....od desiateho poschodia je už mŕtve...."              ', 283, 3, 16),
	(2149, 'Príde babka k lekárovi a sťažuje sa:\r\n”Viete, pán doktor, ja tak veľmi kašlem!”\r\nLekár otvorí okno, ukáže na protiľahlý cintorín a hovorí:\r\n”Viete, čo by dali za to, keby mohli kašlať?”              ', 225, 3.75, 16),
	(2150, 'Šiesti hrajú hokej. Ktosi dostane hokejkou po tvári a na zem spadnú oči. Všetci sklonia hlavy a hovoria:\r\n”Koho sú tie oči?”\r\nJeden sa pýta:\r\n”Kde?”              ', 179, 3.79, 16),
	(2151, '”Dnes som po dvadsiatich rokoch mala prvýkrát radosť, že vidím svojho muža.”\r\n”A čo sa stalo?”\r\n”Pozvali ma na identifikáciu.”              ', 160, 3.5, 16),
	(2152, '”Pán Jozef, prečo ste neboli na pohrebe vašej svokry?”\r\n”Ale viete, ako to je. Samá práca a na zábavu neostáva čas.”              ', 146, 3.87, 16),
	(2153, '”Deti, prečo toľko prehadzujete ten piesok?\r\n”Hrali sme sa s dedkom na pohreb a teraz nevieme, kam sme ho zahrabali!”              ', 139, 3.38, 16),
	(2154, 'Pustil som si žilu, motorovou pílou.              ', 52, 3.29, 16),
	(2155, 'U ľudožrútov:\r\n”Deti, k stolu! Dnes sú zákusky! Naporcovala som vám chutného cukrovkára...              ', 114, 3.25, 16),
	(2156, '”Môj brat je zápasníkom v Bratislave.”\r\n”A s kým zápasí?”\r\n”So smrťou.”              ', 104, 3.6, 16),
	(2157, 'Horolezec optimista a horolezec pesimista sa odtrhnú z útesu.\r\nHorolezec pesimista kričí: ”PADÁÁÁM!”\r\nHorolezec optimista kričí: ”LETÍÍÍM!”              ', 173, 3.67, 16),
	(2158, 'Idú dvaja ľudožrúti po púšti. Uvidia na zemi kostru a jeden povie:\r\n”Aha! Chrumky!”              ', 107, 3.76, 16),
	(2159, 'Londýnsky komisár sa pýta:\r\n”Keď sa váš manžel chystal vyskočiť z okna na deviatom poschodí, povedali ste mu niečo?”\r\n”Áno, upozornila som ho, že prší, aby si vzal nepremokavý plášť.”              ', 224, 3.5, 16),
	(2160, 'Dva levy sa pozerajú do lekárskej tašky a pritom si hovoria:\r\n”Bol to dobrý lekár!”\r\n”Áno, bol! Škoda, že z neho nezostalo na zajtra!”              ', 164, 3.67, 16),
	(2161, 'V zime zastaví policajná hliadka auto plné skínov. Policajt sa pýta vodiča: "Pán vodič a reťaze máte?" Zo zadu sa zborovo ozve: "Máme, máme aj bejzbolky a slzák!"              ', 189, 3.58, 16),
	(2162, 'Ostanú na okraji cesty stáť slepý a koktavý. Slepý sa opýta:"Môžeme ísť? \r\nKoktavý:"Mo-mo-môžeme".Prejdú a ostanú stáť na okraji ďalšej cesty.Slepý sa opýta: "Môžeme?"\r\nKoktavý:"Mo-mo-..." Slepý nepočká a ostane stáť v strede cesty.\r\nKoktavý dopovie:"Modrý kamión!"               ', 313, 3.47, 16),
	(2163, 'Zdravotná sestra sa nakloní nad posteľ a hovorí pacientovi:\r\n”Keď príde lekár, povedzte mu niečo povzbudzujúce, lebo váš zdravotný stav mu robí veľké starosti!”              ', 193, 3, 16),
	(2164, 'Starostlivý otec sa pýta manželky:\r\n”Myslíš, že je ešte nášmu Jankovi zima?”\r\n”Nie, dala som ho na päť minút do mikrovlnky.”\n', 145, 3.5, 16),
	(2165, '”Mami, čo bude dnes na večeru?”\r\n”Zalez! Nehovorila som ti, že nemáš vyliezať z tej trúby?!”              ', 121, 4, 16),
	(2166, 'Peter príde na družstvo a hovorí:\r\n”Predseda, ja som vašu dcéru Maru nó, hmmm, tóó...”\r\nPredseda na to:\r\n”Keď sa stalo, stalo sa. Teraz si ju však musíš zobrať za manželku.”\r\n”Ój, to nie. Ja som ju prešiel traktorom!”              ', 259, 3.9, 16),
	(2167, '”Pán doktor, čo mi je?”\r\n”Keď umriete, budem múdrejší...”\r\n”A potom mi poviete, čo mi je?”              ', 123, 3.1, 16),
	(2168, '”Fero, nevieš ako by som sa zbavil svojej ženy?”\r\n”Skús ju zastreliť!”\r\n”Už som ju zastrelil, ale pýtam sa, ako sa jej mám zbaviť.”              ', 165, 3.89, 16),
	(2169, 'Dva medvede sledujú mladých chlapcov, ako sa opíjajú v lese.\r\nJeden sa otočí k druhému a hovorí:\r\n”Dáme im ešte pol hodiny. Chutia lepšie, keď sa nechajú marinovať.”              ', 197, 3.83, 16),
	(2170, 'V nemocnici sa z narkózy preberie pacient po amputácii nôh a pýta sa sestričky:\r\n”Kde to som?”\r\n”V nemocnici... z väčšej časti.”              ', 159, 3, 16),
	(2171, 'Patológ zastaví na chodbe lekárku Koubkovú a vraví jej:\r\n”Pani doktorka, čo mi v poslednej dobe posielate na pitevňu za mŕtvoly? Každá druhá sa pýta, či to nebude bolieť.”              ', 203, 3.84, 16),
	(2172, '"Sranda musí byť" povedala babka a hodila medzi deti granát.              ', 77, 3.86, 16),
	(2173, 'Pán Kováč sa obesil na okne kravatou. Manželka sa vrátila z nákupu, rozbehla sa k nemu a vraví:\r\n”No, to si celý ty, zase si si vzal tú špinavú.”              ', 174, 4.09, 16),
	(2174, '”Pani Nováková, počula som, že u vás horelo.”\r\n”Máte pravdu, zhorel môj muž i s deťmi, ale našťastie sme boli poistení.”\r\n”A vám sa nič nestalo?”\r\n”Ale, mňa len bolí zápästie.”\r\n”A to ako? Z čoho?”\r\n”No, najprv som niesla ten ťažký kanister a potom som držala kľučku, aby tie svine neutiekli.”\n', 343, 3.78, 16),
	(2175, 'Sedia dvaja, beznohý a slepý pri moste a jeden hovorí tomu druhému:"Ty debil, ja som ti vravel, že sova húka inak."              ', 135, 3.75, 16),
	(2176, 'Chlapovi sa narodí syn. V nemocnici sa pýta lekára: \r\n-Pán doktor, no ako sa má? \r\n-Viete, máme tu menší problém, Váš syn je ako kliešť. \r\n-Prečo, pije krv? \r\n-Nie, hlava zostala vo vnútri.              ', 218, 3.25, 16),
	(2177, 'Ako zistíš, koľko má dieťa rokov?\r\nOdrežeš mu nožičky a zrátaš letokruhy.               ', 99, 3.6, 16),
	(2178, 'Malá Lucka je v záhrade a práve zakopáva jamu. Zbadá ju sused a slušne sa jej pýta:\r\n”Lucka, čo robíš v záhradke?”\r\n”Zomrela mi akváriová rybička, tak ju pochovávam” vraví dievčatko so slzami v očiach. Sused sa stále zaujíma:\r\n”Ale to je obrovská jama, pre takú malú rybičku, všakže?”\r\nLucka zahrnie poslednú kôpku zeme a naštvane vraví:\r\n”To preto, lebo je v žalúdku vašej sprostej mačky.”               ', 455, 4.21, 16),
	(2179, '”Mami, mami, prečo je tá voda taká horúca?”\r\n”A čo si si myslel, že ťa zjem surového?”              ', 116, 3.5, 16),
	(2180, 'Janko pribehne k mamičke a vrieska: "mama, mama ocko sa obesil v garáži!"\r\nMama sa vráti z garáže a hovorí: "Janko, ale veď tam nik neni!" \r\nA Janko povie: "1.apríl, obesil sa v deckej izbe."              ', 214, 3.86, 16),
	(2181, 'Móricko pribehne na čerpaciu stanicu a hovorí:\r\n”Ujo, rýchlo nám dajte 10 litrov benzínu!”\r\n”A načo vám bude?”\r\n”Horí nám škola!”               ', 167, 3.9, 16),
	(2182, 'Príde princ do krematória, v ruke  drží črievičku a pýta sa správcu:         \r\n- Neviete, kde by som našiel  Popolušku?              ', 143, 4, 16),
	(2183, 'Príde pani na policajnú stanicu a začne vykrikovať:\r\nZabila som kohúta! Príde k nej policajt a pani opakuje to isté.\r\nPlicajt začne spisovať protokol a pýta sa pani: "Ako sa vôbec voláte?"\r\nPani Kohútová!               ', 233, 4.14, 16),
	(2184, 'Lekár vyjde z operačnej sály a hneď sa naňho vrhnú príbuzní:\r\n”Pán doktor, ako dopadla operácia? Je všetko v poriadku? Boli nejaké komplikácie? Môžme vidieť nášho Jana?”\r\nDoktor len podvihne obočie a obráti sa na sestru:\r\n”Sestra, to nebola pitva?”              ', 290, 3.96, 16),
	(2185, 'Mladá mamička bola so svojím synom na návšteve u známeho doktora. Nijako sa nesnažila brániť synovi, ktorý rozhadzoval doktorovi ordináciu. Keď sa však ozval zvláštny rachot, povedala:\r\n”Dúfam, že vám nevadí, že sa tam Petríček hrá!”\r\n”Nevadí. On stíchne, keď sa dostane k jedom.”              ', 328, 3.8, 16),
	(2186, 'Primár vraví po operácii manželke pacienta:\r\n”Milá pani, v žalúdku vášho manžela sme našli karburátor.”\r\n”To je čudné, veď on nikdy nič také nejedol.”\r\n”To bude tým, že váš manžel tiež ešte nikdy nemal takú vážnu dopravnú nehodu.”              ', 284, 4, 16),
	(2187, 'Ide mamička so synčekom na matematickú súťaž, lenže synček má menšiu telesnú vadu. Má štyri ruky\r\na šesť nôh. Keď sú na železničnej stanici, chlapček ide na záchod. Zrazu sa ozve veľký krik a zo záchodu vybehne údržbár a hovorí:\r\n”Zažil som už všeličo, ale takého veľkého hajzlového pavúka som ešte nezabil.”               ', 366, 3.97, 16),
	(2188, 'Príde turista k bačovi a pýta sa ho:\r\n-Bača, odkiaľ máte ten pkný kožuch?\r\n-Jááj, to mám od partizánov.\r\n-Bača, počúvajte,dajte mi ho.\r\n-Ho,ho,ho, sám si zastreľ!\n', 180, 3.5, 16),
	(2189, '”Mami, prečo nesmiem škrtiť kamaráta?”\r\n”Boleli by ťa ručičky, synček môj.”              ', 106, 3.7, 16),
	(2190, 'Kamarátka sa pýta:\r\n”Ivana, prečo si berieš na tú zámorskú plavbu aj čierne šaty?”\r\n”No, môj manžel nevie dobre plávať...”              ', 157, 3.67, 16),
	(2191, 'Pohrebnému vozu sa v ostrej zákrute otvoria zadné dvere a rakva s mŕtvolou vyletí von. Rakva sa otvorí a mŕtvola preletí rovno do kasární. Službukonajúci vojak do mŕtvoly vypáli celý zásobník. Onedlho dorazí sanitka a "ťažko zraneného" prevezú do nemocnice. Po 4 hodinách sa otvoria dvere na operačke, chirurg si zotrie pot z čela a povie:" Uf, bola to síce makačka, ale bude žiť!!!"              ', 426, 3.87, 16),
	(2192, 'Do preplnenej čakárne vstúpi doktor v bielom plášti, vytiahne samopal, všetkých pacientov do jedného postrieľa a povie: \r\n”Tak, a toto bola posledná dávka, ktorú vám hradí vaša zdravotná poisťovňa!”              ', 234, 3.67, 16),
	(2193, 'Sanitka ide z dopravnej nehody s ťažko raneným do nemocnice, keď zrazu prestane fungovať motor. Vodič sa otočí dozadu k lekárovi a vraví:\r\n”Blbé, zdochlo mi to.”\r\nLekár na to:\r\n”Hm, aj mne.”              ', 224, 3.88, 16),
	(2194, 'Príde Stalin do Gulagu so samopalom v ruke a hovorí deťom : \r\n-Deti, dnes máte Mddddddddddd.....\n', 101, 3.46, 16),
	(2195, 'Kúpe sa mama a jej 14-ročná dcéra je pri nej v kúpeľni. "Mami, a kedy budem mať ja také medzi nohami, čo máš ty?" pýta sa dcéra\r\nMama:"Dorastieš a a aj ty budeš mať." \r\nO týždeň sa kúpe otec a dcéra je v kúpelni znova: "Oci, a kedy budem mať medzi nohami také aké máš ty? Otec:"Keď mama pôjde do obchodu!"              ', 348, 3.64, 16),
	(2196, 'Rozprávajú sa dve mŕtvoly:\r\n-Hnije mi ruka!\r\n-Viem tečie mi tadiaľ oko!              ', 90, 3.93, 16),
	(2197, 'Jožko príde do školy po štyroch dňoch absencie a učiteľka sa pýta: "Jožko kde si bol?"\r\non jej odpovie: "Mali sme doma problém, dedko sa spálil"\r\n"Jožko, to je mi ľúto, je moc spálený?"\r\n"Áno pani učiteľka, tí sa v tom krematóriu neserú".              ', 274, 3.4, 16),
	(2198, 'Chlapíkovi zomrela manželka, no on až potom zavolá doktora. Doktor mu hovorí:\r\n”Preboha, človeče, prečo ste ma nezavolali skôr? Azda vám nehovorila, že jej je zle?”\r\n”No hej, čoby nehovorila. Ale tak som si pomyslel, komu je dnes dobre?”              ', 271, 3.83, 16),
	(2199, '”Babička, čo dostal dedo pod stromček?”\r\n”Infarkt.”              ', 76, 3.78, 16),
	(2200, 'Babka chytí vnúčika za čelo a vraví:\r\n”Vnúčik, si čoraz teplejší.”\r\n”Nie babka, to ty si čoraz chladnejšia.”              ', 142, 3.75, 16),
	(2201, 'Práve prebieha pohreb tragicky zosnulej princeznej Diany. Na pohrebe sa zúčastňujú tisícky ľudí. Prichádza princ Charles, manžel zosnulej, spolu so svojimi dvoma synmi. Mladší syn s údivom pozerá, koľko veľa ľudí je na pohrebe jeho matky a pýta sa otca:\r\n”Otec a prečo je tu tak veľa ľudí?”\r\nPrinc Charles sa pozrie na svojho syna a odpovie mu:\r\n”Vieš synček, Elton John nespieva každý deň!”              ', 441, 3.78, 16),
	(2202, 'Muž leží na smrteľnej posteli a zrazu cíti, ako sa k nemu z kuchyne nesie vôňa čerstvých pagáčikov. Z posledných síl sa zosunie\r\nz postele a doplazí sa do kuchyne. Ako sa tak naťahuje po pagáčiku na sporáku, zbadá to žena, rýchlo priskočí, buchne ho po ruke a skríkne:\r\n”Necháš to, to je na kar!”              ', 340, 4.09, 16),
	(2203, 'Príde muž so ženou do obchodu a muž hovorí:\r\n”Dajte mi zelenú kravatu.”\r\nŽena na to:\r\n”Ale drahý, čo si vojak alebo policajt?”\r\n”Tak mi teda dajte modrú.”\r\nŽena:\r\n”Ale, čo si sa zbláznil? Veď modrá ti predsa nepristane.”\r\nMuž vytiahne pištoľ, zastrelí manželku a hovorí:\r\n”Prosím, dajte mi čiernu.”              ', 355, 3.67, 16),
	(2204, 'Fero vraví doma:\r\n”Dnes som videl vonku tak škaredé decko, že mu matka musela uväzovať rezeň okolo krku, aby sa s ním aspoň psi hrali.”              ', 162, 3.8, 16),
	(2205, 'Pri rieke sedí chlapček a plače.\r\n”Prečo plačeš?” pýta sa okoloidúci.\r\n”Lebo mi pred chvíľou spadol do vody chlieb.”\r\n”S maslom?”\r\n”Nie, s bratom.”              ', 187, 2.8, 16),
	(2206, 'Bavia sa dvaja epileptici:\r\n”Počul som, že si včera v bare vyhral súťaž breakdance.”\r\n”Hej, ale chcel som si len objednať colu.”              ', 157, 3.43, 16),
	(2207, 'V rodine kynológa sa narodili trojčatá. V pôrodnici ich priniesli ukázať šťastnému otcovi. Ten ich chvíľu pozorne prezerá\r\na potom hovorí:\r\n”Toho stredného nechajte.”              ', 198, 3.42, 16),
	(2208, 'Chlap mal gangrénu na pravej nohe a lekár skonštatoval, že už sa nič nedá robiť, nedá sa vyliečiť, noha musí preč. Po operácii sa chlap preberie a nad ním stojí doktor a hovorí:\r\n”Mám pre vás zlú a dobrú správu. Tá zlá je, že máme novú sestru na operačkách. No, mala trému a tak prehodila snímky a doktor si to nevšimol. No proste sme vám odrezali ľavú a nie pravú nohu.”\r\n”A tá dobrá správa?” pýta sa pacient.\r\n”Neverili by ste, ako vám tá gangréna na pravej nohe ustúpila.”              ', 545, 4.08, 16),
	(2209, 'Vo väzení je malomocný a koktavý. Malomocnému odpadne ruka po zápästie. Vezme a vyhodí ju von cez okno. Odpadne mu po lakeť vezme a ju vyhodí von. Odpadne mu celá ruka vezme vyhodí ju von.\r\nKoktavý mu povie "Zzzzddrháš?..              ', 250, 4.08, 16),
	(2210, 'Pacient pred operáciou leží na operačnom stole. Operujúci lekár hovorí svojmu asistentovi:\r\n”Musíme mu amputovať pravú nohu.”\r\n”Švac!”\r\n”Musíme mu amputovať ľavú ruku.”\r\n”Švac!”\r\n”Ruku!”\r\n”Švac!”\r\n”Ľavú!”\r\n”Švac!”\n', 266, 4, 16),
	(2211, 'Doktor pacientovi:\r\n”Vidíte tú malú bodku na snímke vašich pľúc?”\r\n”Áno vidím. Takže to nebude až také zlé, však?”\r\n”Tak to je jediné zdravé miesto.”              ', 191, 4.11, 16),
	(2212, 'Príde babka k doktorovi a hovorí:\r\n”Pán doktor, viete, ja by som sa chcela milovať ako za mlada, aby krv striekala, chlpy lietali.”\r\n”No dobre babka, tak poďte dozadu za plentu.”\r\nBabka ide za plentu a potom jej doktor hovorí:\r\n”Babka, o týždeň príďte na kontrolu!”\r\nBabka príde o týždeň na kontrolu a hovorí:\r\n”Jáj, pán doktor, tak ste mi pomohli! Ako za mlada! Krv strieka, chlpy lietajú!”\r\n”No dobre babka, tak poďte za plentu nech vám vyberiem tú žiletku.”              ', 517, 3, 16),
	(2213, 'Pán sa po autonehode preberie v nemocnici. A lekár mu hovorí, že má preňho dve správy. Jednu dobrú a druhú zlú.\r\n- Ktorú chcete počuť skôr? - pýta sa lekár.\r\n- Tak teda najskôr tú zlú. - odpovedá pacient.\r\n- Amputovali sme vám obe nohy.\r\n- Tak teraz tú dobrú. - hovorí pacient a dúfa, že tá ho ukľudní.\r\n- Vidíte tamtú sestru? - pýta sa lekár.\r\n- Hmm, pekná. - odpovedá pacient.\r\n- Tak s tou chodím.               ', 450, 3.86, 16),
	(2214, 'Príde Róm k doktorovi s nožom v chrbte a hovorí:\r\n- Pán dochtor, pozrite čo mi urobili. Pomôžte mi!\r\n- Ale... No... Viete, už je za päť minút štyri a o štvrtej končím. Skúste prísť zajtra.\r\n- Ale šak ako môžem s týmto vydržať do zajtra?!?! Urobte s tým dačo.Doktor sa zamyslí.Potom mu vytiahne nôž z chrbta a pichne mu ho do oka:\r\n- Na očnom sú do šiestej!\n', 390, 3.92, 16),
	(2215, 'Do krčmy vbehne chlap: \r\n- Neviete, kto tu má takého veľkého čierneho psa s bielym obojkom?\r\n- Takého tu nemá nikto.\r\n- Tak potom som zrazil farára.              ', 171, 3.8, 16),
	(2216, 'Slepý a jednooký sa vyberú cez les za babkou. Keďže slepý nevidí, vezme si ho na ramená jednooký a vyrazia. Ako idú lesom jednooký sa potkne na konáry a o halúzku si vypichne aj to druhé oko a hovorí slepému: no! a už sme došli! A slepý nato: Dobrý deň babka!              ', 294, 3.75, 16),
	(2217, 'Idú dvaja muži vo výťahu a jeden sa pýta:\r\n- Počúvaj, toto je rýchlovýťah?\r\n- Nie, to sme sa odtrhli.              ', 125, 3.8, 16),
	(2218, 'Pri horiacom dome hovorí muž známemu:\r\n- Cítim karamel.\r\n- Viem, môj dedo mal cukrovku.\n', 93, 3.67, 16),
	(2219, 'Sedí Záhorák v krčme a rozpráva kamarátom:\r\n“Chlapi, ten rogalo, to musí byť silný vták! Sedemkrát som musel streliť, aby toho chlapa pustil!”              ', 172, 3.91, 16),
	(2220, 'Otázka pre rádio Jerevan:\r\n- Dvorím istej dáme, stále ma však odmieta. Mám ju pomilovať alebo zastreliť?\r\nOdpoveď:\r\n- Najprv zastreliť.\n', 147, 3.69, 16),
	(2221, '- Aký je rozdiel medzi týždňovou a dvojtýždňovou mŕtvolou?\r\n- Keď zahryznete do nosa týždňovej a potiahnete, idú iba soplíky a keď dvojtýždňovej, idú soplíky aj očičká.              ', 205, 2.75, 16),
	(2222, 'Pesnička na želanie:\r\nProsím zahrajte pesničku pre môjho beznohého priateľa "Sám s nohami nastole".\r\nS pozdravom\r\nMichael Jackson              ', 151, 2.67, 16),
	(2223, 'Príde sociálna pracovníčka do bytu vychýrenej rodiny. Otvorí jej malý postihnutý chlapček. Pracovníčka sa ho pýta:\r\n- Kde máš maminku?\r\n- Vo väzení.\r\n- A otecka?\r\n- Neviem.\r\n- A máš nejakých súrodencov?\r\n- Mám brata!\r\n- A kde je brat?\r\n- On je na univerzite!\r\n- Na univerzite? - čuduje sa žena. - A čo tam robí?\r\n- On je tam v liehu, on má dve hlavy!              ', 390, 3, 16),
	(2224, 'Pilot nadväzuje núdzové spojenie s riadiacou vežou:\r\n- Mayday, mayday... Horí nám ľavý motor!\r\n- Uveďte do činnosti núdzové hasenie v sektore A3.\r\nMotor je uhasený a let prebieha normálne, ale o chvíľu...\r\n- Mayday, mayday... Horí nám pravý motor!\r\n- Uveďte do činnosti núdzové hasenie v sektore A4.\r\nOpäť sa to podarí, ale...\r\n- Mayday, mayday... Horia nám oba motory!\r\n- Opakujte po mne: Otče náš, ktorý si na nebesiach...              ', 469, 4.17, 16),
	(2225, 'Vedúci reštaurácie v Texase zúfalo pribehne k jednému z hostí a kričí:\r\n- Človeče, veď vy ste nám zastrelili vrchného!\r\n- Nerobte tu krik, pripíšte mi to na účet.              ', 193, 3.86, 16),
	(2226, 'Dvaja kamaráti sa stretnú a jeden hovorí druhému:\r\n- Tak čo, kam sa chystáš tento rok na dovolenku?\r\n- Idem na Amazonku na ryby.\r\n- Tam nechoď, stúpiš na krokodíla a ten ti odhryzne nohu skôr, ako sa spamätáš. \r\nPo dovolenke sa stretnú a jeden má drevenú protézu a hovorí:\r\n- Mal si pravdu s tým krokodílom, tento rok ideme s rodinou do Afriky na safari.\r\n- Nie, tam nechoď, skočí na teba leopard a odhryzne ti ruku.\r\nPo dovolenke sa opäť stretnú a jeden má miesto nohy protézu a miesto ruky hák.\r\n- Mal si pravdu, leopard mi odhryzol ruku, ale to nič. Už mám zaplatenú dovolenku v Himalájach.\r\n- Poslúchni ma konečne a nechoď tam. Orol skalný sa spustí strmhlav z výšky a vykole ti oko.\r\nPo dovolenke sa opät stretnú a ten jeden má sklenené oko. Kamarát sa ho pýta:\r\n- Tak čo, zase som mal pravdu? Orol skalný?\r\n- Ale nie. Vieš, leziem hore po skale a vtom mi do oka padol kamienok. No a ja v tom háku ešte nemám taký cit...              ', 995, 4.02, 16),
	(2227, 'Ide misionár po púšti a odrazu sa pred ním zjaví lev. Misionár sa začne modliť:\r\n-Pane bože, daj prosím ťa tomuto levovi kresťanské myšlienky a cítenie.\r\nLev sa postaví na zadné, zopne laby a hovorí:\r\n- Ďakujem ti Bože za jedlo, ktoré môžem prijať.              ', 286, 4.11, 16),
	(2228, 'Malý Dežo otvorí dvere a tam stoja dvaja skíni. Jeden má baseboalku a druhý má bandasku s benzínom.\r\nA malý dežo zakričí ERDŽA prišli kúpači.              ', 171, 3.73, 16),
	(2229, 'Čo je to humor?\r\nJedno dieťa v jednom kontajneri.\r\nČo je to čierny humor?\r\nJedno dieťa v desiatich kontajneroch.\r\nČo je morbídny humor?\r\nDesať detí v jednom kontajneri.\r\nA čo je pekelný humor?\r\nDesať kontajnerov v jednom dieťati.              ', 256, 4.14, 16),
	(2230, 'Dievčatko si vloží do úst granát, ten exploduje a roztrhne jej ústa od ucha k uchu. Ostatné deti jej hovoria: „Ty krava, ty sa tomu smeješ, ale nás to mohlo zabiť!"              ', 190, 3.44, 16),
	(2231, 'Príde muž za majiteľom pohrebného ústavu. \r\n"Prosím vás, koľko u vás stojí jeden úplne diskrétny pohreb?" \r\n"No, záleží na tom, akú si vyberiete truhlu." \r\n"Potreboval by som lacnú, pevnú a hlavne zvukotesnú. To viete, svokra nie je ešte tak úplne po smrti."\n', 280, 3.6, 16),
	(2232, '- Rozprávajú sa Nemec, Američan a Rus už po smrti v nebi, o tom kto mal najhoršiu smrť. Nemec hovorí : \r\n"Ja som mal strašnú smrť, dostal som na narodeniny novú motorku, išiel som sa povoziť a zabil som sa."\r\nAmeričan hovorí : \r\n"Ja som dostal na Vianoce lietadlo, hneď som ho išiel vyskúšať, letel som nízko a zabil som sa."\r\n"To je nič", hovorí Rus, "môj brat dostal bicykel a ja som zomrel od hladu."              ', 441, 3, 16),
	(2233, 'Dedka prešiel parný valec. Babka nevedela, čo s ním, tak ho dala pred dvere ako rohožku. Prišla zima, ľudia si doňho utierali nohy, dedko prechladol a umrel.              ', 179, 3.58, 16),
	(2234, 'Vbehne chlap do krčmy celý udýchaný a pýta sa:\r\n"Chlapi, kto tu má veľkého čierneho tlstého psa s bielym obojkom?"\r\n"No, nikto."\r\n"Tak som vám prešiel farára."\n', 173, 2.83, 16),
	(2235, 'Prečo spáchal Hitler samovraždu?\r\n???\r\nPrišiel mu účet za plyn.              ', 83, 3.17, 16),
	(2236, 'Majú popraviť Američana a Rusa. Môžu si vybrať, či chcú guľku, lano alebo kreslo. Američan si vyberie kreslo, cvak, ale nič sa nestane tak ho prepustia. Pošepká Rusovi, že nejde prúd. Tak Rus vojde dovnútra, a keď sa ho pýtajú, čo si vyberie, tak povie:\r\n"Keď nejde prúd, tak ma trebárs zastreľte."\n', 323, 4, 16),
	(2237, 'Aký je rozdiel medzi nadrogovaným a nafetovaným?\r\nNafetovaný lepšie horí.\n', 80, 3.5, 16),
	(2238, 'Idú dve palice po púšti. Jedna biela a druhá čierna. Čo je to?\r\n- Slepý Somálčan.\n', 91, 3.71, 16),
	(2239, 'Do pôrodnice príde čerstvý otec, aby sa pozrel na svoje dieťa. Podíde k plexisklovej stene, za ňou sa objaví lekár a ťahá novorodeniatko za nohu. Zastaví sa a začne tým miminom búchať o stenu. Všade strieka krv a otec omdlie. Za chvíľu sa preberie, nad ním sa skláňa lekár a ukľudňuje ho:\r\n- Pane, preberte sa, to bol iba žart, ono sa aj tak už narodilo mŕtve!              ', 402, 3.93, 16),
	(2240, 'Leží babka na koľajniciach a narieka:\r\n- Moje nohy! Moje nohy!\r\nIde okolo železničiar a kričí:\r\n- Čo nariekate, babka, veď žiadne nemáte.              ', 162, 4, 16),
	(2241, '- Mami, kto je tento černoško?\r\n- Hii, Janko, nedotýkaj sa babičky, ona je pod prúdom!              ', 105, 2.6, 16),
	(2242, 'Malé dievčatko sa hrá s granátom. Ten vybuchne a roztrhne jej ústa od ucha k uchu. Ostatné deti kričia:\r\n- Ty sa na tom smeješ, ale nás to mohlo zabiť!              ', 175, 3.63, 16),
	(2243, '- Deti, neťahajte dedka za fúzy! \r\nA vôbec, zavrite už tú rakvu!              ', 83, 3.86, 16),
	(2244, '- Sedí to v kúte a usmieva sa. Čím viac sa to usmieva, tým viac je to červené. Čo je to?\r\n- Dieťa, ktoré oblizuje žiletku.              ', 147, 3.44, 16),
	(2245, 'Chlapík leží v nemocnici po ťažkej autonehode. Príde za ním lekár a vraví:\r\n- Vaša žena utrpela ťažký otras mozgu a je nadosmrti dementná.\r\n- Bože. A čo môj syn?\r\n- Museli sme mu amputovať nohy, zvyšok života strávi na vozíku.\r\n- O môj bože! A čo moja dcéra?\r\n- Odtrhlo jej polovicu tela, už nikdy nevstane z lôžka.\r\n- Bože! Vy si zo mňa robíte srandu?\r\n- Áno,... Všetci sú mŕtvi.              ', 431, 3.67, 16),
	(2246, 'Príprava nedeľného obeda\r\n"Deti, rozlúčte sa so svojou najmladšou sestričkou, voda už vrie!"              ', 114, 3.33, 16),
	(2247, 'Stretnú sa dve susedky:\r\n- Pani suseda, ako sa volá váš malý chlapček?\r\n- Digitálky.\r\n- Digitálky? A to prečo?\r\n- Lebo sa narodil bez ručičiek.              ', 168, 3, 16),
	(2248, 'Do pôrodnice sa vlúpal kanibal. Zobral jedného novorodenca a utekal preč. Spozoruje to sestra a kričí za ním:\r\n”Počkajte, ja vám ho aspoň zabalím!”\r\n”Ste láskavá, ale to nemusíte,” odpovedá kanibal, ”zjem to po ceste!”              ', 259, 3, 16),
	(2249, 'Babička sa odchádzajúc z krematória smutne obzrie na čierny dym vychádzajúci z komína a povzdychne si:\r\n”Tak vidíš dedko, konečne ťa niekto vyfajčil až do konca.”              ', 194, 2.6, 16),
	(2250, 'Chlapík sedí v nemocnici pred operačnou sálou. Zo sály vyjde doktor po ťažkej päťhodinovej operácii a hovorí:\r\n”Viete, operácia dopadla v podstate dobre, ale vaša žena upadla do kómy. S tým súvisí veľa starostí. Budete ju musieť prevracať kvôli preležaninám, vymieňať plienky, dávať infúzie a lieky.”\r\nChlapík si tak pomyslí:\r\n”Sakra, som v najlepších rokoch a teraz sa musím o ňu starať.”\r\nDoktor po chvíli:\r\n”Ale nie, srandujem, umrela!”              ', 503, 3.43, 16),
	(2251, '- Pán doktor, ako dlho budem ešte maródovať? - pýta sa ťažko chorý pacient lekára.\r\n- Dlho nie, za chvíľu budete ako rybička.\r\n- Taký zdravý? \r\n- Nie, taký studený.              ', 194, 3.85, 16),
	(2252, '- Viete, čo by sa stalo keby vybuchli Jaslovské Bohunice?\r\n- V Čechách by sa spievalo Nad Tatrou sa blýska a na Slovensku Kde domov můj.\n', 143, 3.58, 16),
	(2253, '- Čo vám to napadlo, ukradnúť auto?\r\n- Myslel som si, že nemá majiteľa.\r\n- Prečo, preboha?\r\n- No, keď stálo pred cintorínom...              ', 151, 3.25, 16),
	(2254, '- Musím prestať fajčiť, pán doktor? \r\n- Nie, na to by už teraz bolo neskoro.              ', 96, 3.67, 16),
	(2255, '- Koľko života mi ešte zostáva? - pýta sa s obavami svokra svojho zaťa - lekára v nemocnici.\r\n- Nemajte strach, mama, dnešné raňajky určite ešte stihnete - vtipkuje zať, ale potom sa pozrie na svokru a s obavou v hlase dodá:\r\n- Keď si sestra s nimi pohne!              ', 284, 3.86, 16),
	(2256, '- Tak som bol dať utratiť svojho psa...\r\n- Bol besný?\r\n- No, nadšený práve nebol...              ', 103, 3.75, 16),
	(2257, '-Čo je absolútna hrôza?\r\n-Keď sa vám zježí parochňa na hlave.              ', 83, 3.57, 16),
	(2258, '- Vieš, aký je rozdiel medzi Slovákom a ľudožrútom ?\r\n- ???\r\n- Slovák sa pýta: “Čo je na obed, mama?“ a ľudožrút: “Čo je na obed? Mama?”\n', 158, 3.75, 16),
	(2259, '- V ktorej izbe sa nachádza ten pán, čo ho prešiel vlak?\r\n - V izbách 134 a 135.  \n', 88, 3.4, 16),
	(2260, 'Ide babka na bicykli. Policajt sa jej pýta:\r\n- Kam idete, babka?\r\n- Na cintorín.\r\n- A kto donesie naspäť bicykel?\n', 118, 3.8, 16),
	(2261, 'Loď sa potápa. Kapitán príde k cestujúcím:\r\n- Kto z vás sa vie modliť ?\r\n- Ja, hrdo sa hlási jeden z cestujúcích.\r\n- To je dobré, pretože nám chýba jedna záchranná vesta!              ', 201, 3.89, 16),
	(2262, 'Marienka perie prádlo v rieke a dedko s babkou sa dívajú, ako jej to pekne ide. Zrazu sa uvoľní kameň zo skaly nad Marienkou, padá dole a zabije Marienku. Dedko to pozoruje a povie: \r\n- Vodný kameň to je prevít, zase nám rozbil práčku.\n', 249, 3.75, 16),
	(2263, 'Pán sa po autonehode preberie v nemocnici. Doktor mu hovorí: \r\n- Mám pre vás jednu dobrú a jednu zlú správu. Ktorú chcete počuť ako prvú? \r\n- Tak tú zlú.\r\n- Amputovali sme vám obe nohy.\r\n- Tak teraz tú dobrú, - chce sa nechať ukľudniť pacient. \r\n- Vidíte tamtú sestričku? \r\n- Hmm, pekná. - odpovie pacient. \r\n- Tak s tou chodím.              ', 366, 4, 16),
	(2264, 'Idú dvaja starí známi kanibali oproti sebe a jeden nesie pod pazuchou urnu... Jeho kolega sa pýta... \r\nProsím ťa, kde si zohnal instant???"               ', 160, 3.78, 16),
	(2265, 'Ide lovec po púšti a uvidí leva. Chce nabiť pušku, ale zistí,  že mu  došli náboje,  padne na  zem a začne sa modliť: \r\n"Pane Bože, daj tomuto levovi kresťanské myšlienky." \r\nLev  padne na  kolená a  modlí sa: \r\n„Pane Bože,  požehnaj tento pokrm, čo hodlám prijať...."              ', 306, 4, 16),
	(2266, 'Čo to znamená, keď je vyvesená čierna zástava?\r\n- Máme voľné miesta.              ', 91, 4, 16),
	(2267, 'Letuška: \r\n„Nie je medzi cestujúcimi lekár?"\r\n„Jeden z cestujúcich sa postaví a ide do pilotnej kabíny. \r\nZa chvíľu vyjde a pýta sa: \r\n„Nie je medzi cestujúcimi pilot?"              ', 198, 3.75, 16),
	(2268, 'Súdia amerického gangstra, ktorý spáchal ohavné zločiny. Je stratený, vie to dobre, no v zúfalej nádeji sa nakloní k advokátovi a pýta sa ho: \r\n"Prosím vás, ako to so mnou vyzerá?" \r\n"Myslím, že si budete môcť vybrať." \r\n"Ako to myslíte?" \r\n"Medzi jednosmerným a striedavým prúdom."              ', 320, 3.76, 16),
	(2269, 'Ide pohrebný sprievod. Zastaví ich policajt: \r\n”Koho to pochovávate?” \r\n”Svokru.” \r\n”A prečo truhlu nesiete nabok?” \r\n”Lebo na chrbte chrápe.”              ', 177, 4, 16),
	(2270, 'Manželia s dvomi deťmi idú autom na výlet až prídu k zátarase, kde ich zastaví policajt. Ten vraví vodičovi, že tam ďalej je strašná búračka, množstvo krvi, voľne pohodené ruky, nohy, hlavy bez tiel, no proste masaker. Vodič sa pozrie na rodinku do auta, všetci jemne prikývnu. Kývne teda na policajta: \r\n- Tak dobre ... dva pre dospelých a dva detské.              ', 391, 3.8, 16),
	(2271, 'Horoskop na dnešný deň:\r\nCelý deň Vás budú ospevovať, vynášať Vás do nebies a obsypávať kvetmi.\r\nPohreb je už raz taký ...              ', 152, 3.89, 16),
	(2272, 'Umre manžel p.Novákovej, ona trúchli nad jeho truhlou, keď v tom príde jeho kolega a vraví:\r\n"V Rusku vymysleli takú injekciu, že keď ju vpichnú mŕtvemu, môžeš sa s ním rozprávať ešte pol hodinu." \r\nOna na to, že je to báječné. Kolega na to:\r\n"Len to má jednu nevýhodu, že ti neodpovie."              ', 326, 3.82, 16),
	(2273, 'Lord Hook usporiadal párty v svojom loveckom zámočku. Medzi trofejami visí hlava ženy s podivným úsmevom.\r\n„Kto je tá žena?"\r\n„To je moja svokra."\r\n„A čo ten záhadný úsmev ako Mona Lisa?"\r\n„Nuž, do poslednej chvíle si myslela, že ju idem fotografovať."              ', 291, 3.38, 16),
	(2274, 'Aký je rozdiel medzi anglickou a sicílskou poisťovňou?\r\nV anglickej poisťovni vám na základe štatistík povedia, koľko ľudí v budúcom roku zomrie. V sicílskej vám povedia aj ich mená.              ', 212, 3.57, 16),
	(2275, 'Idú dvaja ľudožrúti po púšti, keď zrazu uvidia kostru. Vtedy jeden povie druhému: \r\n"Aha, chrumky!"              ', 121, 2.75, 16),
	(2276, 'Lekár hovorí pacientovi:\r\n- Je mi ľúto, ale tú nohu musíme amputovať!\r\n- Uff, to mi odľahlo, už som sa zľakol, že mi zakážete piť...              ', 160, 3.72, 16),
	(2277, 'Predám psa. Zožral mi svokru.\r\nZnačka: Kupujte, pokiaľ mu chutí!              ', 83, 2.6, 16),
	(2278, 'Staré tety zvykli chodiť za mnou pri svadbách, šťuchajúc ma do rebier a chichotajúc sa mi vravievali:\r\n”Ty budeš nasledujúca...”\r\nPrestali po tom, čo som im začala robiť to isté pri pohreboch...              ', 225, 3.71, 16),
	(2279, 'Rudo s Gustom idú na bicykloch. Predbehne ich prvý cyklista - bez hlavy. Predbehne ich druhý cyklista - tiež bez hlavy. Rudo sa naserie a hovorí: \r\n“Gusto, zlož tú kosu, lebo nás zavrú.”              ', 213, 3, 16),
	(2280, 'Sedí chlapík pred televízorom, keď vtom zaklope niekto na dvere. Chlapík sa pozrie cez kukátko, ale nikoho nevidí. Otvorí dvere a vidí pred dverami stáť malinkú smrťku s kosou. Strašne sa naľaká a začne nervózne behať po byte. Smrťka mu na to hovorí: \r\n„Ukľudni sa, ja som si prišla po škrečka.“               ', 339, 4.13, 16),
	(2281, 'Príde pán do chovproduktu a vraví predavačovi:\r\n„Prosím si 3 potkanov, 2 myši, 25 švábov a 40 záchodových pavúkov.“\r\n„Uff, no hádam to dám dokopy. A načo to vôbec potrebujete?“\r\n„Ale, sťahujem sa a v zmluve je bod, že mám vrátiť byt do pôvodného stavu.“\r\n„Vy ste ale srandista“, - usmeje sa predavač.\r\n„Mne to až také smiešne nepripadá. Poobede idem vykopať toho dedka, ku ktorému som sa vtedy prisťahoval...“              ', 473, 4.25, 16),
	(2282, 'Idú dve kostry na motorke a jedna z nich si za sebou ťahá náhrobný kameň. Kameň strašne búcha, iskrí, vlastného slova si nepočuť. Až to napokon tú druhú kostru naštve a spýta sa:\r\n- Počúvaj, na čo ťaháš so sebou ten náhrobný kameň?\r\nA tá druhá jej na to:\r\n- Však musím mať so sebou nejaké doklady, nie ?!!”              ', 355, 3.97, 16),
	(2283, 'Ide Janko do lesa a nájde kružidlo.               ', 52, 1.85, 16),
	(2284, 'Jeden opilec si skrátil cestu domov cez cintorín. Tam však spadol do vykopanej\r\njamy a zaspal. Ráno sa prechladne, prebudí sa a nadáva:\r\n"Sakra, to je zima."\r\nA pani, čo bola kúsok ďalej položiť kytičku, hovorí:\r\n"Tak čo si sa odkopal?"\n', 251, 3.88, 16),
	(2285, 'Vpadne do saloonu kovboj, cez celý podnik ustrelí barmanovi fľašu v ruke a frajersky hovorí:\r\n"I\'m Billy."\r\nZa chvíľu sa dvere rozletia znovu, vpadne iný kovboj.\r\nUstrelí barmanovi cigaru z huby a povie drsne:\r\n"I\'m Johhny!"\r\nDotretice sa rozletia dvere, tretí ustrelí kovboj barmanovi hlavu a hovorí potichu:\r\n"I\'m sorry."\n', 336, 3.89, 16),
	(2286, 'Vieš, kde je najväčšia sranda?\r\nNa cintoríne.\r\nPoložia tam cez teba dvojmetrákový kameň s nápisom:\r\n"Nech ti je zem ľahká."\n', 136, 4, 16),
	(2287, 'Šofér autobusu a kňaz zomrú a prídu k Sv. Petrovi. Šoféra \r\nhneď pošle do neba, zatiaľ čo na kňaza sa ani nepozrie.\r\nKňaz čaká, no potom to nevydrží a pýta sa:\r\n"Ako to, že ja musím čakať a šofér išiel okamžite do neba?"\r\nSv. Peter odpovie:\r\n"Keď si ty kázal, všetci spali, zatiaľ keď riadil ten šofér, všetci sa modlili!"\n', 357, 3, 16),
	(2288, '"Ako ste sa dnes hrali?"\r\n"Na Divoký západ."\r\n"Zajtra sa budete hrať tiež na Divoký západ?"\r\n"Nie, na to už nie sú ľudia, zajtra hráme na hromadné pochovávanie."\n', 174, 3.43, 16),
	(2289, 'Z pitevnej správy:\r\nPacient zomrel na následky pitvy.\n', 56, 4.18, 16),
	(2290, '"Mototechna? Tu krematórium! Koľko ste včera predali tých nových japonských motoriek?"\r\n"Dvadsať."\r\n"Dvadsať? Tak to sa nám ešte traja flákajú niekde po meste."\n', 173, 4.09, 16),
	(2291, 'K doktorovi sa priplazí chlap, v chrbte nôž a narieka, že umiera, \r\nnech mu pomôže. Doktor:\r\n"No chlape, sú dve a ja práve končím, z toho dnes už nič nebude."\r\n"Predsa ma takto nenecháte!!!" \r\n"Máte pravdu," povie lekár, vytiahne nôž z chrbta, bodne mu ho do oka a hovorí:\r\n"Choďte na očné, tam majú do štvrtej."\n', 336, 4, 16),
	(2292, '"Nie pane, na arzenik musíte mať recept, fotka vašej svokry skutočne nestačí."\n', 85, 3.29, 16),
	(2293, 'Pracujú dvaja chlapi na výškovej budove a počujú sanitku. Jeden hovorí:\r\n"To je výkon, nie je to ani 5 minút, čo mi spadlo na ulicu kladivo a sanitka už je tu!"\n', 171, 3, 16),
	(2294, 'Jedným uchom dnu, druhým von a predsa to zostane v hlave. Čo je to?\r\nKrompáč.\n', 83, 3.64, 16),
	(2295, 'Sára je na smrteľnom lôžku a prosí manžela:\r\n"Khon, sľúb mi, že až umriem, pôjdeš za rakvou s mojou matkou."\r\n"Tak dobre, Sára, ja ti to sľubujem, ale upozorňujem ťa, že budem mať kvôli tomu skazený celý deň."\n', 232, 4, 16),
	(2296, '"Karl, na čo umrela Steinova prvá žena?"\r\n"Otrava hubami."\r\n"A druhá tiež otrava hubami?"\r\n"Nie, prerazená lebka."\r\n"To je divné."\r\n"Ani nie, nechcela jesť huby."\n', 171, 3, 16),
	(2297, 'Aaron  stretne Mojseho v Berlíne a pýta sa, kde bol celý deň. Mojse odpovedá:\r\n"Ale, bol som na Hitlerovom pohrebe."\r\n"No, a aké to bolo, čo sa tam dialo?"\r\n"Najprv rakvu spustili do diery, potom ju zas vytiahli a\r\nzase spustili a tak asi dvanásťkrát."\r\n"Čože? A prečo?"\r\n"Niet sa čomu diviť, keď mal taký aplauz."\n', 332, 4.09, 16),
	(2298, 'Keď zomriem, chcel by som odísť kľudne v spánku, ako môj dedo a nie kričiac s vlasmi zježenými hrôzou, ako cestujúci jeho autobusu.\n', 143, 3.9, 16),
	(2299, 'Ležia dvaja vandráci pri koľajniciach, obaja bez nôh. A jeden hovorí druhému:\r\n"Ja som ti hovoril, že sova húka inak!"\n', 127, 3.57, 16),
	(2300, 'Posledný deň v roku vedú odsúdenca na smrť. Odsúdenec je ale podozrivo veselý, pospevuje si a veselo poskakuje. Katovi už to pripadá divné a tak sa ho spýta:\r\n"Človeče, viete vôbec, čo vás čaká!?"\r\n"Viem! Konečne budem raz na Silvestra poriadne sťatý!"\n', 274, 3.5, 16),
	(2301, 'Kat hovorí svojej obeti:\r\n"Môj úder mečom bude tak dokonalý, že ho ani nepocítiš!"\r\nOdsúdenec skepticky krúti hlavou.\r\n"Stavme sa!"\r\nStavia sa. Vzápätí povie kat:\r\n"Hotovo. Cítil si dačo?"\r\n"Nič. Čo som mal cítiť?"\r\n"Skús skloniť hlavu."\n', 259, 3.33, 16),
	(2302, 'Režisér hovorí hercovi:\r\n"V budúcej scéne skočíte z mostu do vody."\r\n"Ale ja neviem plávať," odpovie herec.\r\n"To nevadí, aj tak už je to posledný záber."\n', 167, 3.8, 16),
	(2303, 'Muž ide otvoriť. Za dverami stojí divný chlap s maskou na tvári a hovorí:\r\n"Ja som strašne brutálny zabijak žien."\r\nMuž sa obráti a volá:\r\n"Oľga! Máš tu návštevu."\n', 181, 3.33, 16),
	(2304, 'Príde muž domov a pýta sa ženy:\r\n"Máme niečo na večeru?"\r\n"Nie, nič."\r\n"Tak ja si niečo urobím."\r\n... a vyskočil z okna.\n', 132, 3.56, 16),
	(2305, '"Kde máte manžela?"\r\n"Na cintoríne."\r\n"A čo tam robí? Zalieva?"\r\n"Ale nie, vyvaľuje sa tam, leňoch jeden."\n', 114, 3.71, 16),
	(2306, 'Mexičan sa baví s barmanom:\r\n"Vidíš toho chlapíka v tom veľkom sombrére?"\r\n"Všetci majú sombréro."\r\n"Toho s tým koltom za pásom."\r\n"Ale všetci majú kolt za pásom."\r\nMexičan sa zdvihne, začne zúrivo strieľať a potom sa zase oprie o bar:\r\n"Ten, čo zostal stáť."\r\n"Aha, už ho vidím."\r\n"Tak toho strašne neznášam!!"\n', 340, 4.18, 16),
	(2307, 'Na stavbe reže chlap cirkulárkou a odreže si prst. Hrozne kričí, zbehli sa ostatní a pýtajú sa, ako sa to stalo:\r\n"Normálne režem a zrazu fik... kúrnik, druhý."\n', 173, 3.67, 16),
	(2308, 'Počuli ste o tom Boeingu, čo spadol vo Varšave na cintorín?\r\nPoľské úrady uvádzajú, že zatiaľ našli 2000 tiel.\n', 123, 3.8, 16),
	(2309, 'Učiteľ v škole v Čechách sa pýta detí, čo by sa stalo, keby na Slovensku vybuchla jadrová elektráreň. A Pepíček odpovedá:\r\n"Vymenili by sme si s nimi hymnu. Oni by spievali Kde domov muj, a my by sme spievali Nad tatrou sa blýska."\n', 247, 3.8, 16),
	(2310, 'Dvaja Slováci v roku 1944 sú odsúdení za na smrť zastrelením. Na poslednú chvíľu je rozsudok zmenený na šibenicu. Už so slučkou na krku jeden hovorí:\r\n"Nehovoril som ti že im už dochádza munícia?"\n', 215, 4.06, 16),
	(2311, 'Stalin si raz pozval jedného generála. \r\n"Koľko máš rokov, súdruh?" pýta sa Stalin.\r\n"Zhodou okolností, budem mať zajtra šesťdesiat."\r\nStalin sa usmial:\r\n"Nebudeš."\n', 177, 3.5, 16),
	(2312, 'Stalin sa prechádzal po dedine a uvidel pri potoku ženy. \r\n"Čo robíte, súdružky?"\r\n"Perieme prádlo!"\r\nStalin sa usmial:\r\n"Len perte, perte, zajtra sa bude vešať."\n', 172, 4.08, 16),
	(2313, 'Viete, kde boli za totality v Európe najprísnejší colníci?\r\nPredsa u nás. Všade bola rádioaktivita po Černobyle, len k nám ju nepustili.\n', 147, 4, 16),
	(2314, 'Jeden kvetinár prišiel o prácu. Vždy splietol objednávky. Jedna žena dostala kvety, objednané manželom, ktorý bol na služobnej ceste. Pri kytici našla lístok:\r\n"Prijmite úprimnú sústrasť."\r\nOveľa viac sa prekvapila práve ovdovená žena, ktorá mala na lístočku:\r\n"Je tu teplejšie, než som myslel. Škoda, že tu nie si tiež."\n', 350, 4.14, 16),
	(2315, 'Raz príde sheriff do saloonu a vidí na zemi m?tveho muža. Pýta sa barmana:\r\n"Hráč?"\r\n"Áno."\r\n"Falošný?"\r\n"Áno."\r\n"Poker?"\r\n"Nie, husle."\n', 147, 3.25, 16),
	(2316, '"Vážení cestujúci, hovorí k vám kapitán lietadla. Ak sa pozriete na ľavé krídlo, zistíte, že horí. Pohľadom na pravé krídlo zistíte to isté. Ak sa pozriete dole, uvidíte padák. To som ja. Prajem vám príjemnú cestu."\n', 239, 3.95, 16),
	(2317, 'Je to hnedé a je to medzi prstami slona?\r\nPomalí domorodci.\n', 62, 3.88, 16),
	(2318, 'Aké su posledné slová krátkozrakého v lese ?\r\n"Prepáčte, vy vždy oberáte maliny v takom veľkom kožuchu??"\n', 117, 3.67, 16),
	(2319, 'Príde zajac do mäsiarstva a pýta sa: \r\n"Mate bravčové?" \r\n"Áno." \r\nV tom zajac vytiahne pištoľ, odstrelí mäsiara a povie:\r\n"To máš za prasiatko."              ', 171, 3.6, 16),
	(2320, 'Ako nazývame Šípkovú Ruženku po dotyku s vysokým napätím?\r\nPopoluška.              ', 92, 3.9, 16),
	(2321, 'Pri ceste stopuje smrtka, zastaví jej chlapík na kabriolete: \r\n- Kam to bude tetuška?\r\n- Aaale, synak len tuto pol kilometra do jednej ostrej zákruty.              ', 168, 3.71, 16),
	(2322, 'V pohrebnej službe: \r\n- Potreboval by som truhlu, nizučkú, ale dosť širokú. \r\n- Načo vám taká truhla bude? \r\n- Aaaale, kamarátovi sa neotvoril padák.              ', 174, 4.2, 16),
	(2323, 'Žena sa pýta manžela:\r\n- Vrátil si susedovi vidly?\r\n- Vrátil.\r\n- A čo povedal?\r\n- Áááaa...\n', 100, 3, 16),
	(2324, 'Otázka na rádio Jerevan:\r\nBude mäso v Moskve? Áno!\r\nBude mäso v Leningrade? Áno!\r\nBude mäso vo Vladivostoku? Áno!\r\nÁno!!! Mäso bude všade...\r\nvýstava prejde celým Sovietskym zväzom!\n', 196, 4.09, 16),
	(2325, 'Idú dve malomocné dievčatká do školy, jedna hovorí druhej:\r\n- To som zvedavá, čo nám dnes odpadne!              ', 121, 3.83, 16),
	(2326, 'Stretnú sa dvaja členovia Al-Kaidy a jeden cmúľa čokoládu. Druhý sa pýta:\r\n- Kde si zohnal tú čokoládu ?\r\n- Tam v tom obchode za rohom.\r\n- Je tam veľa ľudí?\r\n- Ani nie, tak na jeden zásobník.              ', 221, 3.86, 16),
	(2327, 'Na súde sa pýtajú homosexuála:  Prečo ste znásilnili tu mníšku!   Ja zato nemôžem keď vypadala zo zadu ako Zorro!              ', 138, 3.09, 16),
	(2328, 'Muž číta knihu, žena časopis.\r\n"To je hrozné," vykríkne zrazu žena, "v New Yorku sa jeden muž doobeda zoznámil so ženou, večer sa s ňou oženil a na druhý deň ráno ju zabil!"\r\n"A čo je na tom zvláštne?" flegmaticky odvetí muž, "Ráno múdrejšie večera."              ', 290, 3.87, 16),
	(2329, 'V tatranskej dedinke Maruška perie prádlo v potoku. Babička s dedom ju sledujú. Zrazu sa z blízkej skaly odtrhne veľký kameň, spadne priamo na Marušku a zabije ju. Dedo vraví babičke:\r\n- Vidíš, vodný kameň nám zničil našu práčku.              ', 263, 3.95, 16),
	(2330, 'Výkrik z márnice\r\n"Ach, drahá, prečo si ku mne taká chladná!"              ', 81, 2.71, 16),
	(2331, 'Rozprávajú sa dvaja sadisti:\r\n- Tebe sa páčia oči mojej ženy?\r\n- Hej, páčia.\r\n- Tak si ich zober...\n', 108, 3.38, 16),
	(2332, 'Je večer, Jožo pozerá televízor a vtom zazvoní telefón. Jožo zdvihne a na druhej strane sa ozve ženský hlas:\r\n- Ahoj Jožo, to som ja, Zuzka. Spoznali sme sa minulé leto a vtedy v aute si mi povedal, že som fajn dievča.\r\n- Á, ahoj Zuzka a ako sa máš?\r\n- No, nie veľmi dobre! Som tehotná a o desať minút skočím pod vlak!\r\n- No Zuzka, ty si fakt super dievča!              ', 393, 3.64, 16),
	(2333, 'Z laboratória\r\n"Haló? Je tam pohotovosť? Rýchlo niečo robte, lebo naša laborantka je v druhom stave!"\r\n"Len sa ukľudnite a odvezte ju k nám do pôrodnice."\r\n"Ale vy mi nerozumiete! Ona je v kvapalnom stave!!!"              ', 231, 3.6, 16),
	(2334, 'Smrteľne chorý pacient sa pýta sestričky:\r\n"Sestrička, mám ešte nejakú šancu?"\r\n"Vy? Vy vôbec nie ste môj typ!"              ', 136, 3.6, 16),
	(2335, 'Chlap príde do nemocnice na nejaké testy, lekár sa naňho čudne pozrie a vraví:\r\n- Mám pre vás dve správy.\r\n- Aha, tak najprv tú zlú.\r\n- Musíme vám amputovať obe nohy.\r\n- A tá dobrá?\r\n- Chlap z vedľajšej izby od vás kúpi topánky.              ', 263, 3.33, 16),
	(2336, 'Lekár hovorí pacientovi:\r\n- Dnes užite dve tablety a ak sa zajtra ráno ešte zobudíte, tak užite ďalšie dve.              ', 130, 3.14, 16),
	(2337, 'K lekárovi do ordinácie vbehne vystrašená sestrička a kričí:\r\n- Pán doktor, ten pacient, čo od vás teraz vyšiel, zomrel rovno v čakárni!\r\n- Rýchlo ho otočte, aby to vyzeralo, že ešte len vchádzal. - vraví lekár.              ', 245, 3, 16),
	(2338, '"Veža, tu Boeing 747 na trase Boston - New York, vypadli nám všetky motory, čo máme robiť?? Opakujem! Veža, tu Boeing 747 na trase Boston - New York, vypadli nám všetky motory, čo máme robiť? Ozvite sa!!!"\r\n"Tu veža, nekričte, kľud, už si vás škrtám..."	               ', 288, 3.38, 16),
	(2339, 'Novákovi zomrela žena. Zabezpečil jej dôstojnú rozlúčku. Obrad začal farár slovami:\r\n"Vážení prítomní smútiaci pozostalí, opustila nás verná a poslušná manželka, milá a láskavá žena..."\r\nVtom Novák skríkne:\r\n"Malér! Rýchlo preč! Sme na inom pohrebe!"              ', 294, 3.85, 16),
	(2340, 'Sedia dve veveričky na strome a zrazu jedna hovorí tej druhej:\r\n"Zhodím ťa!"\r\nA zhodila ju.              ', 109, 3.36, 16),
	(2341, 'Žena leží na smrteľnej posteli. Muž kľačí pri nej a drží ju za ruku. Ženine bledé pery sa pohnú:\r\n"Drahý, musím..."\r\n"Drahá, nič nehovor."\r\n"Drahý, musím ti niečo povedať. Musím sa k niečomu priznať."\r\n"Drahá, nič nehovor. Nie je k čomu sa priznávať. Všetko je v poriadku."\r\n"Nie, nie je. Musím umrieť s pokojnou dušou. Musím sa ti priznať, drahý, bola som ti neverná."\r\nManžel ju pohladí a vraví:\r\n"Netráp sa tým, drahá. Viem o tom všetko. Prečo myslíš, že by som ťa inak otrávil?"              ', 546, 3.86, 16),
	(2342, 'Chlapík leží v nemocnici. V tom príde za ním pán a pýta sa ho: \r\n- Koľko vážite a meriate? \r\n- Vážim 82 kg a meriam 182 cm, pán doktor.\r\n- Ja nie som lekár, ja som truhlár.              ', 201, 3.97, 16),
	(2343, 'Príde pani do nemocnice a pýta sa na svojho manžela. Doktor jej \r\noznamuje: \r\n-Pani Nováková, mám pre vás smutnú správu. Váš manžel mal nádor na mozgu. Snažili sme sa ho zachrániť, ale zomrel hneď po amputácii hlavy...\n', 237, 3.93, 16),
	(2344, 'Teta sa pýta Jožka:\r\n”Čo si robil cez prázdniny Jožko?”\r\n”Bol som pri mori s maminkou a jej novým priateľom.”\r\n”A čo, páčilo sa ti? Skamarátil si sa s novým ujom?”\r\n”On je super kamoš! Každé ráno ma brával loďkou päť kilometrov od pláže a ja som potom vždy plával k brehu.\r\n”A vládal si toľko plávať?”\r\n”Plávanie bolo fajn, najhoršie bolo vymotať sa z vreca.”              ', 426, 4.06, 16),
	(2345, 'Stretnú sa dvaja známi a jeden vraví:\r\n”Moja žena má rada malé deti.”\r\n”Moja nie, je vegetariánka! ”              ', 129, 3.29, 16),
	(2346, 'Dedo sa pýta lekára:\r\n”Pán doktor, povedzte mi pravdu, čo mi je?”\r\n”No, do smrti nemôžete jesť.”\r\n”Ale veď to nevydržím.”\r\n”Nebojte sa, tie dve, tri hodiny určite vydržíte.”              ', 216, 3.71, 16),
	(2347, 'Vojaci obsadili dedinu a začali znásilňovať všetky ženy. Prišlo aj na starú babku. Dedko dohovára vojakom: ”Nehanbíte sa, veď je stará!”\r\n”Čuš dedko,” zahriakne ho babka, ”vojna je vojna!”               ', 229, 3.78, 16),
	(2348, 'Na finálovom zápase SuperBowl v americkom futbale sedí chlapík na jednom z najlepších miest. Na zaplnených tribúnach kopa ľudí a vedľa neho jedno voľné miesto. Ďalšiemu chlapíkovi v rade to nedá, a tak neutrálne vraví: \r\n"Neviem si predstaviť, že by si niekto zaplatil toto miesto a potom sem neprišiel." \r\nNato náš chlapík hovorí: \r\n"Viete, ja som kúpil už pred mesiacom lístok pre seba a ženu, lenže tá medzitým náhle ochorela a zomrela." \r\n"Ach, to je mi ľúto. Ale prečo ste ten lístok nedal niekomu z rodiny?" \r\n"Všetci z rodiny sú na pohrebe."              ', 602, 3.83, 16),
	(2349, '- Pán vyšetrovateľ, ako ste prišli k poznatku, že obeť bola zavraždená uškrtením Kosmodiskom? \r\n- Viete, nebolo to až také ťažké "Jediné, čo ho prezradí, je úsmev na tvári..."              ', 209, 3.4, 16),
	(2350, 'V sanitke ide šofér , sestrička, doktor a pacient. Po krátkej chvíli sa šofér chytí rukami za krk akoby sa škrtil alebo akoby niekde visel... Sestrička ho tresne kabelkou po hlave a normálne pokračujú v jazde Po chvíli sa celá situácia zopakuje. Keď sa to stane už potretí krát, tak to pacient nevydrží a spýta sa doktora: \r\n- Prosím vás, čo je tomu šoférovi? Je v poriadku??? Môže šoférovať??? A doktor vysvetľuje: \r\n- Viete, tuto sestričke sa včera obesil manžel a on si z nej robí srandu...\n', 532, 4.22, 16),
	(2351, 'Supertajné ruské prepadové komando nastúpi do lietadla a naberie kurz na Čečensko. Komandír vydáva posledné pokyny:\r\n- Za každú hlavu čečenského rebela dostanete fľašu vodky a 3 dni dovolenky. Tak sa snažte!!!\r\nPo hodine letu lietadlo pristane, a než stihne komandír niečo povedať, borci vyskáču \r\nz lietadla a zmiznú v tme. O chvíľu sa ozýva streľba, výbuchy granátov a neľudský rev. Za pol hodiny sa molodci vracajú, každý drží v ruke za vlasy dve-tri hlavy. \r\nNato komandír povie:\r\n- Chorošo, molodci, chorošo. Ale toto bolo len medzipristátie v Kyjeve...              ', 613, 3.63, 16),
	(2352, 'Do IT firmy prijmú do oddelenia vývoja ako špecialistov piatich kanibalov. Behom uvítacieho ceremoniálu im šéf hovorí:\r\n- Keď budete pracovať usilovne, môžete tu zarobiť pekné peniaze, chodiť do kantíny, ale len za predpokladu, že nebudete obťažovať ostatných spolupracovníkov.\r\nKanibali sľúbia, že nikoho obťažovať nebudú. O štyri týždne príde šéf a hovorí:\r\n- Som s vami spokojný, pracujete tvrdo a usilovne. Mám však jeden problém, zmizla upratovačka. Neviete, čo sa s ňou stalo?\r\nPo odchode šéfa sa vedúci kanibalov pýta ostatných:\r\n- Ktorý idiot zožral tú upratovačku?\r\nJeden sa prihlási a vedúci naňho kričí:\r\n- Ty somár, už štyri týždne tu jeme manažérov, projektových manažérov, vedúcich a zatiaľ si nikto nič nevšimol. A ty musíš zožrať akurát upratovačku!!!              ', 858, 4.15, 16),
	(2353, ' Čo je vrchol drzosti? Povedať slepému, že je taký sprostý jak ďaleko dovidí...', 87, 3.43, 16),
	(2354, '- Je to v koši na prádlo a smrdí to...čo je to?\r\n- Mŕtvy Azuritko.', 71, 2.14, 16),
	(2355, 'Ide smutný Samko po ceste domov. Ide okolo jeho sused a vraví: Samko prečo plačeš? Samko povie: stratil som 10 korún. Sused vraví neplač ja ti dám desať korún. Samko poďakuje a rozplače sa. Sused sa pýta prečo plačeš? Už máš desať korún. Samko vraví: Uhm mám, ale keby som ju nestratil mal by som 20 korún!', 331, 3.41, 16),
	(2356, 'Stretnú sa dvaja Poliaci.\r\nJeden sa pýta toho druhého.... \r\nKde bývaš???TAM', 80, 2.5, 16),
	(2357, 'Je to červené a sedí to v kočíku, čo je to?\r\nDieťa žuje žiletku', 72, 3.08, 16),
	(2358, 'Skinhead stoji v autobuse, hola hlávka, bombera, kanady....\r\nBabka sa na neho chvíľku pozerá, potom sa postaví a milo povie....\r\n-joj, chúďatko, sadni si, pozrite, po tej chemoterapii mu ešte aj ortopedické topánočky dali.', 233, 3.87, 16),
	(2359, 'Sedí babka na koľaji, nepočuje vláćik, odrazu má rušňovodič na okienku fliaćik...', 91, 3.3, 16),
	(2360, 'Očko mi steká po líčku,\r\naha-mám v ňom vidličku!\r\nTo však ešte nie je nič,\r\nz uší mi už tečie hnis!\r\nA v ústach mám len zuby štyri,\r\nostatné mi všetky zhnili!', 177, 3.53, 16),
	(2361, 'V jedno mestečku je jeden ujko na najrýchlejšom trabante v celom mestečku. Ale ešte niekto má taký istý ale nevie ho vôbec dobehnúť tak si kúpi Opel. A keď už išiel tak si ho vystrihol aby ho dobehol  ale nikdy sa mu to nepodarí tak je na pokraji nervov, tak si kúpi Ferari a keď zase išiel, tak si ho zase vystriehol a keď ho už konečne dobiehal, tak vo ferari otvoril okno a vraví mu \r\n"Čo teraz budeš robiť?,,\r\nA v tabante vraví :\r\n"zaraím dvojku,,', 479, 3.19, 16),
	(2362, 'Američania darujú Somálčanom žalúzie. Somálčania im poďakujú za tie poschodové postele..... ', 103, 3.68, 16),
	(2363, 'Stretnú sa po rokoch dvaja známi. Ten jeden: "Človeče, vy žijete? Ja som počul, že ste zomreli!" Ten druhý: "No vidíte žijem." "Neviem, neviem, ja som to počul od hodnovernejšieho človeka...!"', 205, 2.77, 16),
	(2364, 'Veľká autohavária. Obe autá sú riadne zošrotované, no obom účastníkom sa ako zázrakom nič nestane. Účastníkom je rabín a kňaz. Pri vystupovaní si rabín všimne, že v druhom aute sedí kňaz. Vystúpi z auta a vraví:\r\n- Toto musí byť božia vôľa, božie znamenie pre nás oboch, nech žijeme vedľa seba v svornosti celý život.\r\n- Boh nás osvietil, spravíme čo nám vnukol.\r\n- Aha, auto je celkom rozbité, no omšové víno zostalo celé. Zapime naše zblíženie. - hovorí rabín a ponúkol kňaza.\r\nTen si riadne uchlipne a podá rabínovi fľašu späť. Ten ju zaštupľuje a odloží.\r\n- A vy sa nenapijete na zmierenie?\r\n- Nie, ďakujem, ja radšej počkám na policajtov.\r\n', 711, 4.13, 16),
	(2365, 'Ide černoch po púšti a stretne hada. Had mu hovorí:"splním ti čo chceš ak ma nezabiješ ",a černoch súhlasí. Tak černoch hovorí:"chcem byť biely a chcem aby sa ženy na mňa lepili. A had začne čarovať:" Čáry máry hadia kožka nech je z teba always vložka..', 277, 3.81, 16),
	(2366, 'Marienka, čo mi kúpiš na narodeniny?Alebo nie nie, nehovor mi nič. Nechcem to vedieť. Neboj sa Janko, to sa nikdy nedozvieš', 129, 2.43, 16),
	(2367, 'Je to červené a visí to na plote,čo je to?\r\nZbičované hovno...', 68, 3.13, 16),
	(2368, 'Indiánka perie pod vodopádom bielizeň, zrazu na ňu spadne kameň a zabije ju.\r\nIndián, ktorý to vidí, hovorí:\r\nUff, Uff!!! toto  je už tretia práčka, ktorú mi zabil vodný kameň!', 191, 3.65, 16),
	(2369, 'Čo sa stane s baníkom keď zomrie???? Dostane 3 dni dovolenky a šup šup zase pod zem.', 89, 3.68, 16),
	(2370, 'Farár cestuje autom a uvidí pri ceste billboard, na ktorom je ukrižovaný Ježiš. Pod obrázkom je nápis: - NAJLEPŠIE KLINCE V MESTE. Toto ho úplne rozzúri a ide sa sťažovať do agentúry, kde ho napokon ubezpečia že reklamu zmenia. O týždeň neskôr ide po rovnakej ceste a na mieste kde bol starý billboard, je nový. Je na ňom obrázok kríža, pod ktorým leží Ježiš. Titulok znie: -S NAŠIMI KLINCAMI BY SA TO NESTALO!', 443, 3.7, 16),
	(2371, 'Vidíš? Nevidíš! Tak vidíš, na čo si sa hral s tou vidličkou?!', 69, 3.69, 16),
	(2372, 'Máš pekný prúser!\r\nBudeš platiť alimenty!\r\nV kravíne sa totiž narodilo teľa a vyzerá presne ako ty! NO vidíš, neoplatí sa pretiahnuť každú kravu, ktorú stretneš.', 179, 2.74, 16),
	(2373, 'Čo nedokázal ani Casanova? Prepalcovať morskú pannu.', 56, 3.35, 16),
	(2374, 'Ide rodinka Paradajkovcov. Ide otec, syn a mama. Otec je vpredu, mama v strede a syn vzadu. Otca hnevá, že syn stále zaostáva, až nakoniec príde k nemu, dá mu facku a povie:"No poď, kečup!"', 198, 2.71, 16),
	(2375, 'Rozprávajú deti v tábore o veku svojich starých rodičov. \r\nJanko vraví: - Môj starý otec bol taký starý, že si pamätal Napoleona.\r\nZuzanka hovorí: - To je nič, naša stará mama bola taká stará, že si nepamätala koľko má rokov.\r\nOstatné deti prikyvujú, že to bola už dosť stará.\r\nNa to Miško povie: - Ale my sme mali najstaršiu starú mamu, ona bola taká stará, že sme ju museli zastreliť.', 421, 3.69, 16),
	(2376, 'Príde mamka do osady a pýta sa Dežka: "Nechcel by si na Vianoce bračeka abo sestričku?"\r\n"Joj mamo prestaňte, dneska nemám náladu na sex."', 146, 3.37, 16),
	(2377, 'Viete prečo sa Hitler odstrelil?    Pretože mu prišiel veľký účet za plyn.', 81, 3.19, 16),
	(2378, 'Čo cez deň šteká a v noci to spí??\r\nSVOKRIN JAZYK', 54, 3.81, 16),
	(2379, 'Sedí ovca na strome a hovorí: "Hav, hav, ja som ale pekná mačička!!!"', 74, 3.32, 16),
	(2380, 'Ide chlap po ulici a vidí niečo na zemi. Namočí si v tom prst, oblízne ho a vraví si sám pre seba: \r\n"Fuj, hovno, ešte že som do neho nešlápol!" ', 156, 3.9, 16),
	(2381, 'Ide muž za svojim doktorom, lebo má v chrbte zapichnutý nôž... Príde, zaklope a hovorí: "Pán doktor, mám v chrbte zapichnutý nôž, pomôžte mi." A doktor mu hovorí: "Ale my už máme po ordinačných hodinách.." Doktor teda vyberie mužovi nôž z chrbta, vrazí mu ho do oka a vraví mu: "Choďte k očnému, oni majú do štvrtej..."', 349, 3.96, 16),
	(2382, 'V jednej cele spolu sedia zoofil, pedofil, nekrofil a milovník adrenalínových športov.\r\nZzoofil: "Keby tu tak bola nejaká mačka..."\r\nPedofil: "Stačilo by aj mačiatko..."\r\nNekrofil: "A mohlo by byť aj mrtvučké..."\r\nMilovník adrenalínových športov: "Mňau..."  ', 274, 3.3, 16),
	(2383, 'Malý Janko je na prechádzke s mamičkou popri lese. Počas cesty stretnú staršiu  pani. Janko sa jej pýta: "Teta, a nebojíte sa, že vás zastrelia?" "Nie, prečo?" "Lebo vyzeráte ako divá sviňa.."', 206, 3.99, 16),
	(2384, 'Prídu dvaja muži do baru. Jeden hluchý a druhý slepý. Hluchý si kýchne a slepý mu hovorí: "Otvor aj mne tú kolu."', 123, 3.39, 16),
	(2385, '- Viete prečo sa Hitler zabil?\r\n- Lebo dostal účet za plyn!', 62, 3.21, 16),
	(2386, '- Je to čierne a je to za sklom. Čo je to?Dieťa v mikrovlnke. ', 65, 3.17, 16),
	(2387, 'Pri bráne cintorína hľadí muž na podivný sprievod - za rakvou kráča muž s manželkou a psom - dobermanom, a potom dlhá rada mužov. Stojaci muž nevydrží a pýta sa, kto to má pohreb. Muž za rakvou odvetí:\r\n- To je pohreb mojej svokry. Vidíte toho dobermana? To on ju napadol a dohrýzol.\r\n- To je ale pes, nemohli by ste mi ho požičať na pár dní?\r\n- Prečo nie, len sa musíte postaviť na koniec toho dlhého radu!\r\n', 439, 3.84, 16),
	(2388, 'Zatvorili Židov do plynovej komory a pustili na nich plyn. Po chvíli sa zvnútra ozve klopanie. Esesák vrieska: "Čo je?"A zvnútra sa ozve: "Otvorte, jednému tu prišlo zle..."', 181, 3.96, 16),
	(2389, 'Viete čo je normálna smrť?\r\n10 detí v 1 krabici.\r\nViete čo je surová smrť?\r\n10 krabíc v 1 decku.\r\nViete čo je drastická smrť?\r\n1 decko v 10 krabiciach.', 162, 3.43, 16),
	(2390, 'Kúsok od horiaceho domu sa rozprávajú dvaja chlapíci.\r\n"Počuj, necítiš tu karamel?"Je to možné, dedo mal cukrovku!"', 124, 3.49, 16),
	(2391, 'Hovorí Američan Miláncovi: "My zjeme chlieb a kôrky vám dávame ako kroisanty." A Milánec mu odvetí: "A my požujeme žuvačku a vám ju dávame ako kondómi."', 166, 2.91, 16),
	(2392, 'Ide vozičkár cez železničný priechod a zrazu sa zavrú závory.\r\nVozičkár zakričí: Rampár!!!\r\nNikto sa neozve.\r\nVlak je od vozičkára 100m.\r\nVozíčkar opäť kričí: Rampár!!!\r\nVlak je od vozičkára 75m.\r\nVozičkár: Rampár!!!\r\nVlak je od vozíčkara 50m.\r\nVozíčkar skričí: Rampár!!!\r\nVlak je od vozičkára 10m.\r\nRampár vykukne a vraví: Čo je?\r\nVozičkár: Nič, kukaj na tú šupu!', 407, 4.11, 16),
	(2393, 'V knižnici:\r\n- Prosím vás, kde máte nejaké knihy o samovražedných technikách?\r\n- Tamto v regáli.\r\n- A prečo je ten regál taký prázdny?\r\n- To viete akí sú ľudia, požičajú si a nevrátia...', 206, 3.83, 16),
	(2394, 'Mami, prečo ocko kľučkuje po záhrade???\r\n- Nekecaj a nabíjaj!!!', 68, 3.69, 16),
	(2395, 'Kúpil som si andulku,                           dostal som aj škatuľku,      \r\nnemá dierky škatuľka,                           tak mi zdochla andulka.  ', 158, 3.95, 16),
	(2396, 'Príde pán do hotela a pýta sa recepčného: "Mohli by ste mi povedať, kde býva pán ktorého zrazil vlak?""V izbách číslo 134 a 135 - odpovie mu recepčný.', 164, 3.04, 16),
	(2397, 'Hovorí mama synčekovi:\r\n- Jožko prestaň sa špárať starému otcovi v nose, lebo zavriem truhlu.', 101, 3.37, 16),
	(2398, 'Sedí hovienko na konári a vidí uja ako kaká. Hovorí mu: - Ale ujo, ja som chcel sestričku.', 96, 2.59, 16),
	(2399, 'Na nebeskú bránu ktosi klope.Sv. Peter otvorí, uvidí tam chlapíka, ktorý v momente zmizne. Zatvorí bránu, keď v tom znova ktosi klope. Otvorí bránu a tam stojí ten istý chlapík. Toto sa opakuje trikrát. Sv. Peter mu hovorí: "Tak ako, ideš dnu, alebo tu budeš takto pobehovať?" Chlapík odpovedá: "Nemôžem za to, v nemocnici ma ešte stále oživujú."', 373, 4, 16),
	(2400, 'Vojde bača do koliby, rosvieti a koliby nikde..', 48, 3.35, 16),
	(2401, '- Koľko jám potrebujete na pochovanie cigána?\r\n- Dve. Jednu na rakvu a druhú, aby mali červíci kde vracať.', 113, 2.94, 16),
	(2402, 'Ceruzkou si v uchu špáral,\r\nlovil ušný cement, \r\ndo ruky mu niekto drgol,\r\nuž je z neho dement.     ', 105, 3.89, 16),
	(2403, 'Ide cigáň po ceste a stopne skinhaedov.\r\n- Zveziete ma?\r\n- No jasné. Ale najprv musíš hádzať kockou. Keď padne 1-5 zabijeme ťa. Keď padne 6-tka hádžeš ešte raz.', 174, 3.67, 16),
	(2404, 'Viete čo je to maximálna recyklácia? Vyrábanie mydla zo Židov.', 67, 2.69, 16),
	(2405, 'Z policajnej vysielačky: - Hliadka66, hliadka66, v banke na Hlavnej ulici došlo k streľbe! Obeť je 15-krát strelená do hlavy, hovorí, že potrebuje pomoc!', 161, 3.2, 16),
	(2406, 'Ide nevidiaci, nepočujúci a vozíčkar. Prídu pred čarovnú rieku. Prvý prejde nevidiaci a hovorí: "Ja vidím!" Druhý ide nepočujúci a vraví: "Ja počujem!" Posledný ide vozíčkar, vyjde z rieky a hovorí: "Jéj, ja mám nové gumy!"', 245, 3.55, 16),
	(2407, '- Viete prečo blchy a vši nesvietia?\r\n- Lebo z cigánskych osád by bolo Las Vegas.', 85, 3.77, 16),
	(2408, 'V pomocnej skole robili tanečnú súťaž. Vyhral ju jeden chalan, ktorého sa potom spýtali ako to dokázal a on odpovedal: "Ja som si išiel iba pre čaj."', 159, 3.97, 16),
	(2409, 'Muž leží na smrteľnej posteli a zrazu cíti, ako sa k nemu z kuchyne nesie vôňa čerstvých pagáčikov. Z posledných síl sa zosunie z postele a doplazí sa do kuchyne. Ako sa tak načahuje po pagáčiku na sporáku, zbadá to žena, rýchlo priskočí, buchne ho po ruke a skríkne:\r\n"Necháš to, to je na kar!"', 321, 3.32, 16),
	(2410, 'Rozprávajú sa tri babky, že čo je najväčšia bolesť.\r\nPrvá hovorí: Joj baby, nie je horšia bolesť ako mať krámy v päťdesiatke.\r\nDruhá hovorí: Slabé, nie je horšia bolesť ako rodiť v šesťdesiatke.\r\nA tretia na to vraví: Joj baby, a vám ešte nevošla cicka do kolesa?! ', 293, 4.15, 16),
	(2411, '- Viete prečo nemôžu mať rómovia preteky na bicykloch?\r\n- Lebo majitelia by si svoje bicykle spoznali!', 107, 3.61, 16),
	(2412, '- ladko, prečo si v čiernom?\r\n- Ále, predvčerom nám zomrela babka.\r\n- To je hlúposť! Včera som ju ešte videla!\r\n- To sme ju len držali v okne, kým poštárka priniesla dôchodok...', 191, 3.76, 16),
	(2413, 'Chuck Noris vie spraviť dieru do vody.', 39, 2.72, 16),
	(2414, 'V jednej cele vo väzení sedia zoofil, nekrofil, pedofil a extrémista. Nudia sa, a tak zoofil dostane nápad:\r\n"Keby tu bola mačka..."\r\nNekrofil: "Keby bola mŕtva..."\r\nPedofil: "A keby to bolo mačiatko..."\r\nExtrémista: "Miaúúúúúú..."', 245, 3.94, 16),
	(2415, 'Letia dvaja nacisti a jeden cigáň v balóne a klesajú k elektrickému vedeniu.\r\nV tom nacista povie: "Vyhoďme cigáňa." \r\nZjaví sa Sv.Peter a povie: "Nech to je spravodlivé, každému dám jednu otázku a kto odpovie nesprávne, toho vyhodíme."\r\nPríde k prvému nacistovi a pýta sa ho: "V ktorom storočí bola 1.svetová vojna?" \r\nOn odpovedá: "V 20-tom."\r\nPríde za druhým: "Koľko ľudí v nej umrelo?"\r\nOn odpovedá: "10-tisíce."\r\nPríde k cigánovi a vraví mu: "A ty ich vymenuj!"', 499, 3.78, 16),
	(2416, 'Príde veliteľ čaty a vraví vojakom.\r\nDnes je deň odpočinku.\r\nKto bude najviac lenivý dostane opušťák.\r\nVšetci ležia, odpočívajú, lenošia len cigáň stojí.\r\nVeliteľ sa ho pýta: "Prečo neleňošíš?"\r\nCigáň mu odpovie: "Pán veliteľ, ja som už taký lenivý, že sa mi nechce ani sadnúť."', 314, 3.59, 16),
	(2417, 'Ide kanibal, zbadá kostru a povie si:"Aha chrumky!"', 52, 3.84, 16),
	(2418, 'Mama vraví svojmu synovi: "Janko nehraj sa dedkovi s tou kravatou. A vôbec deti, zavrite tú truhlu!"', 103, 3.67, 16),
	(2419, 'Kto druhému jamu kope, zarobí, a potom slope.\r\n ', 50, 3.31, 16),
	(2420, 'Idú dve električky po púšti, prvá ide rovno a tretia ide tiež do ľava.', 77, 3.42, 16),
	(2421, '- Dá sa zapchať jedna diera dvoma?\r\n- Dá. Keď niekomu strčíš nos do zadku ...', 84, 3.41, 16),
	(2422, 'Bezruký hovorí slepému: \r\n- Poďme si postaviť dom. \r\nSlepý hovorí:\r\n- Nevidím v tom prekážku.', 103, 3.82, 16),
	(2423, 'Stretnú sa dve cigánky a jedna vraví druhej: \r\n"Heeej, prečo sa tvoj syn volá digitalka?"\r\n"Preto, lebo nemá ručičky!"', 126, 3.58, 16),
	(2424, 'Eskimák na severnom póle. Jeden z nich sa hral s bumerangom a druhý mu na to: "Ešte raz sa dotkneš mojich ponožiek, tak ti zlomím tvoju deku." ', 150, 4, 16),
	(2425, 'Majitelia firiem medzi sebou: \r\n- Počúvaj, ty dávaš výplaty zamestnancom, keď je kríza? \r\n- Nedávam, a ty? \r\n- Nedávam. A chodia do práce i tak? \r\n- Áno, chodia. \r\n- Počúvaj, a nemali by sme od nich vyberať vstupné?', 230, 4.24, 16),
	(2426, 'Kto druhému jamu kope, isto je hrobár.', 40, 3.89, 16),
	(2427, 'Mamička hovorí svojej dcérke: "Katka, koľkokrát ti mám hovoriť, aby si sa nehrala s nožničkami, pozri koľko prstíkov si natrúsila na koberec."', 154, 3.89, 16),
	(2428, 'Kto druhému jamu kope, zarobí, a potom slope.', 47, 4, 16),
	(2429, 'Potápa sa loď. Starý námorník stojí na palube a ujedá si z krajca chleba. Cestujúci sa ho pýta:\r\n- Človeče, vy máte teraz chuť na jedenie?\r\n- Ani nie, ale lekár mi stále pripomína, aby som skôr ako začnem piť, niečo zjedol.', 243, 3.92, 16),
	(2430, 'Chlapec chce zazvoniť na zvonček susedom, ale je príliš malý. Ide okolo starý dedko a pýta sa chlapca, či chce pomôcť. \r\n"Áno, zazvoňte na zvonček."\r\nDedko zazvoní a chlapec hovorí: "Dobre dedko a teraz zdrhajme!"', 228, 4.04, 16),
	(2431, '- Viete prečo sa všetci boja cigáňa z 1.C?\r\n- Lebo jeho otec je v 8.B.', 74, 4.14, 16),
	(2432, 'Stavia sa Rus, Čech a Slovák kto najďalej  zaprdne.  Rus doprdne 5metrov, ide Čech ten prdne 18 metrov a ide Slovák, zje tanier šošovice a prdne. Fúúúha, všetci sa pozerajú a o mesiac v televíznych novinách hlásia „Neznámy predmet zabil araba na púšti“.', 275, 4.11, 16),
	(2433, 'Viete aký je to sibírsky hajzel?\r\nTo sú dve tyčky, jednu máte zapichnutú v zemi (snehu) a držíte sa jej keď seriete a druhú máte v ruke a odháňate s ňou vlkov.', 173, 4.06, 16),
	(2434, 'Príde babka k lekárovi a žaluje sa, že ju tam dole niečo bolí. Lekár pošle babku za plentu, aby sa vyzliekla. \r\nPo vyšetrení jej hovorí: „Babka, máte zlatú žilu.“\r\nBabka zalomí rukami a vraví: „Však to je na tomto svete akosi prevrátené, ja mám v peňaženke ho ... a v zadku zlato...“\r\n', 315, 4.03, 16),
	(2435, 'Viete prečo sa HITLER zabil?\r\nPrišiel mu účet za plyn.', 58, 4.1, 16),
	(2436, 'Na vojne vybehne vystrašený vojak, máva bielou vlajkou a kričí: "Mier, mier".\r\nOdstreľovač hovorí: "Však mierim, len sa toľko nehýb..."', 146, 4.12, 16),
	(2437, 'Chuck Noris ako prvý dal kyklopovi medzi oči.', 47, 3.44, 16),
	(2438, 'Viete prečo je na svete tak veľa mravcov?\r\nLebo ešte nevymysleli také maličké kondómy.', 93, 4.07, 16),
	(2439, 'Leží muž na smrtelnej posteli a pýta sa:\r\n-Žena moja si tu?\r\n-Som tu.\r\n-Svokra moja si tu?\r\n-Som tu.\r\n-Deti moje ste tu?\r\n-Sme tu.\r\n-Tak načo sa doriti, svieti na tej chodbe!', 180, 2.86, 16),
	(2440, 'Chuck Norris vie vykopať dieru do vody...\r\n', 44, 3.38, 16),
	(2441, 'Partia si opeká cigáňa a jeden vraví: Prečo ho točíš tak rýchlo? \r\nA druhý mu na to odpovedá: Lebo keď ho točím pomaly, tak kradne zemiaky z pahreby.', 163, 4.18, 16),
	(2442, 'Zomrie kardiológ a na pohreb mu príde aj jeho kamarát gynekológ. Truhla s kardiológom vchádza počas smútočného ceremoniálu do veľkého srdca a gynekológ sa začne smiať. Kolega do neho strčí a hovorí mu: "Si normálny?!" A gynekológ na to: "Prepáč, ale predstavil som si kam by som vchádzal ja."', 316, 4.27, 16),
	(2443, 'Učiteľka sa pýta Janka: Janko, keď ti dám 2 jablka a jedno zješ, čo ti ostane?Odpoveď: Ohryzok...  ', 107, 4.2, 16),
	(2444, 'Leží na smrteľnej posteli matka, príde k nej jej syn a hovorí jej:\r\nTak čo mamo, dáme kapurkovu?', 103, 4.18, 16),
	(2445, 'Aké tampóny používa slonica? \r\n?\r\n?\r\n?Ovečky.', 50, 3.86, 16),
	(2446, 'Idú spolu dve malé dievčatká do parku. Jedno sa ide hrať na piesok a druhé zastaví starší pán a hovorí jej:\r"Dievčatko, keď ti dám cukrík, môžem ti pohladkať vlásky?"\r"Tak áno", odpovie dievčatko.\r"A keď ti dám ďalší, môžem ti pohladkať ručičku?"\r"Tak áno."\r"... a keď ti dám ďalší, môžem ti pohladkať nožičku?"\rDievčatko sa otočí na kamarátku a hovorí jej:\r"Ty vole, tento kým ma ošuká, tak dostanem aj cukrovku!"\r', 465, 4.2, 16),
	(2447, 'Manželský pár sa bol potápať v zátoke San Francisca a žena se pritom stratila. Zúfalý manžel sa vrátil domov a oznámil celú vec polícii. Druhý deň ráno zazvoní zvonček a za dveřmi stoja dvaja policisti s vážnym várazom na tvári.\r"Pán Walker? Máme informácie o vašej pani."\r"Čo sa jej stalo?"\r"Máme pre vás tri správy. Jednú zlú, jednu dorbú a jednu skvelú. Ktorú chcete počuť najskôr?" \r"Tú zlú." \r"Našli sme vašu pani utopenú v zátoke." \r"A aká je tá dobrá správa?"\r"Keď sme ju vytiahli, mala na sebbe dobré dva tucty krabov a dve kilá humrov!" \r"No a aká môže byť tá skvelá správa?" \rPolicista sa usmial, mlsne sa olízol a hovorí:\r"Zajtra ráno ju znova vytiahneme!" ', 731, 3.98, 16),
	(2448, 'Vláda padá, vláda padá,\r\n     ktože nám ju postaví?\r\n     Radičová na to nemá\r\n     a Sulík to nespraví.\r\n     Ostáva to na Ficovi,\r\n     ten má veľkú papuľu.\r\n     Čo sa stane, nikto nevie,\r\n     Slovač padá na hubu...', 239, 4.19, 16),
	(2449, 'Vláda padá, vláda padá, \r\n ktože nám ju postaví? \r\n Radičová na to nemá \r\n a Sulík to nespraví. \r\n Zavoláme pána Fica, \r\n ten má veľkú papuľu. \r\nNakriči na Radičovu a tá padne na hubu . ', 207, 4.17, 16),
	(2450, 'Ženská má strašnú chuť na sex, tak ide na diskotéku a zbalí tam\r\nchlapa. Veľa drinkov, vzájomné sympatie a o chvíľu\r\nodchádzajú k nemu. Keď už sú u neho doma, ženská beží na\r\nchvíľu do kúpeľne. Zarazená zistí, že dostala periódu, tak váha,\r\nale keďže stále má strašnú chuť na sex, tak sa to snaží\r\nignorovať. Vlezie k nemu do postele a šuka*ú celú noc.\r\nRáno sa chlap prebudí a pozerá:\r\nŽenská nikde a celá posteľ od krvi!\r\nTak rozmýšľa, čo sa dialo predchádzajúcu noc a napadne mu to\r\nnajhoršie.\r\nIde pozrieť nože - všetky čisté.\r\nIde pozrieť pištoľ - tá je tiež na svojom mieste. \r\nPo chvíli sa pozrie na svoju tvár do zrkadla a skričí:\r\n- Doo pi*e, ja som ju zožral.', 742, 4.19, 16),
	(2451, 'Malý chlapček sa márne pokúša dočiahnuť na zvonček pri dverách.\r\n- Počkaj, pomôžem ti - povie mu okoloidúci starý pán a stisne zvonček.\r\n- Fajn dedo a teraz zdrháme.', 182, 3.43, 17),
	(2452, '- Mami, poď na dvor!\r\n- A načo, Janko?\r\n- Lebo kamaráti mi nechcú veriť, že vyzeráš ako pokémon!', 105, 3.23, 17),
	(2453, 'Janko a Marienka sa hrajú v pieskovisku. Zrazu Janko siahne Marienke pod sukňu a zhrozene sa pýta: \r\n- Marienka! A ty si chlapček? \r\n- Nie, ja kakám.', 154, 3.65, 17),
	(2454, 'Vnúčik sa pýta babky:\r\n"Babka, kde idete?"\r\n"Na cintorín, synku."\r\n"A bycikel kto prinesie späť?"', 103, 3.52, 17),
	(2455, 'Babička vraví vnukovi:\r\n- To je pekné od teba, že si mi priniesol ruže. Vyzerajú presne ako tie v záhrade. \r\n- Ktoré si mala v záhrade, babi.', 150, 3.1, 17),
	(2456, 'Móricko príde domov smutný a mama sa ho pýta:\r\n- Čo je s tebou, Móricko?\r\n- V škole mi všetci hovoria Rambo.\r\n- Tak zajtra pôjdem s tebou a porozprávam sa s tvojimi spolužiakmi.\r\nMóricko zvážnie:\r\n- Nie, mama. Toto je moja vojna.', 243, 3.4, 17),
	(2457, 'Mama sa pýta Evy: \r\n"Eva prečo má ten šalat taku čudnu chuť?"  \r\n"Neviem mami, veď som ho aj mydlom umyla."', 114, 3.51, 17),
	(2458, 'Je to hnedé a vykúkajú z toho dve modré očká, čo je to?  \r\nMaximálne nasraté decko.', 92, 3.3, 17),
	(2459, '- Jožko, už viac nechcem počuť, že sa s bratom bijete!\r\n- Dobre mami, prosím ťa zatvor dvere...', 102, 3.63, 17),
	(2460, '- Oci, čo sú to zásnuby?\r\nOtec sa zamyslí a podá synovi strašne zdĺhavé a strašne komplikované vysvetlenie.\r\n- Rozumieš?\r\n- Nie. Daj mi radšej nejaký príklad\r\n- No zásnuby sú ako keby som ti kúpil bicykel na Vianoce a nenechal ťa na ňom jazdiť až do Veľkej noci.', 284, 3.16, 17),
	(2461, 'Jožko sa nevie doprosiť matku, aby mu dala peniaze do kina. Nakoniec hovorí:\r\n- Mami, ak mi dáš peniaze, poviem ti niečo zaujímavé o ockovi\r\n- Tu máš peniaze. Čo je s ockom?\r\n- Robí s našou susedkou tie isté veci čo ty s našim susedom', 250, 3.16, 17),
	(2462, '- Oci, chcel by som pomôcť jednému starčekovi. Dáš mi na to päť korún?\r\n- Pravdaže synu, to je od teba veľmi šľachetné. Tu máš dvacku. A kde je ten úbohý starček?\r\n- Tamto na rohu. Predáva zmrzlinu...', 220, 3.45, 17),
	(2463, '- Oco, čo to tí dvaja psíčkovia robia? - pýta sa syn otca, ktorý ho v rámci správnej výchovy zobral do prírody. Ten evidentne zaskočený rýchlo nájde vysvetlenie:\r\n- No vieš, sučka nechce ísť domov a psík ju presviedča, aby predsa len šla.\r\nSynovi sa rozsvietia očičká a hovorí:\r\n- Aha, je to ako s mamičkou. Ak by sa nebola dobre držala umývadla, ujo poštár by ju určite odniesol na poštu!', 421, 3.7, 17),
	(2464, 'Mama pečie tortu a volá na syna :\r\n- Jurko, pod vylízať misku.\r\n- A ktorá to vlastne vyhrala?', 98, 3.5, 17),
	(2465, '- Mami, ale to vajíčko je nejaké divné.\r\n- Čuš a jedz!\r\n- Aj zobáčik?', 77, 3.59, 17),
	(2466, 'Dcérka sa pozerá na mamu, ako si nanáša pleťovú masku a pýta sa jej:\r\n- Prečo to robíš?\r\n- Aby som bola krásna.\r\nNeskôr, keď si ju dáva dole, sa jej dcérka pýta:\r\n- Vzdavas to?', 192, 2.91, 17),
	(2467, 'Tri malé bábätká sa rozprávajú. Jedno vraví:\r\n- Ach tie pjobjémy, najastú mi zjúbky, nenajastú mi zjúbky.\r\nDruhé vraví: \r\n- Aj ja mám probjémy. Najastú mi vlásky, nenajastú mi vlásky.\r\nTretie vraví: \r\n- Aj ja mám veľké pjobjemy. Sadla som si na cumlík. Som panna, nie je som panna. Ach tie pjobjémy, pjobjémy.', 336, 3.82, 17),
	(2468, 'Dominik sa prechádza s mamičkou a stretne hrbatého, jednorukého muža so znetvoreným okom. Chvíľu sa udivene pozerá, a potom sa mamičky pýta: \r\n- A toto je aký pokémon?', 180, 3.38, 17),
	(2469, 'U holiča sedí na kresle malé dievčatko a spadne mu na zem žuvačka. Zodvihne ju a šup s ňou do úst.\r\n"A nemáš ju chlpatú?", pýta sa holič.\r\nDievčatko sa naňho nevinne pozrie a vraví:\r\n"Nie, ja mám ešte len 6 rokov."', 233, 3.64, 17),
	(2470, 'Janko hovorí mamičke:\r\n"Idem do lesa na čerešne."\r\n"Janko ale veď je zima."\r\n"Ja viem, mám čiapku a rukavice."', 117, 3.3, 17),
	(2471, 'Matka hovorí svojej babke:\r\n- Ukazovala som chlapcom v škole stojku na hlave.\r\nBabka hovorí:\r\n- Dúfam, že ti nevideli gaťky.\r\n- Ale nie, dala som si ich dole.  ', 166, 3.65, 17),
	(2472, '- Mami, je pravda, že po smrti sa premeníme na prach?\r\n- Áno, zlatko.\r\n- Tak za našou skriňou muselo zomrieť veľa ľudí!', 128, 3.57, 17),
	(2473, 'Janko sa pýta dedka:\r\n- Dedko, máš zuby?\r\n- Kdeže vnúčik, nemám.\r\nJanko okamžite na to:\r\n- Tak mi podrž môj chlebík.', 127, 3.43, 17),
	(2475, '"Mami, prečo majú nevesty biele šaty?"\r\n"To aby vyjadrili svoju radosť, dcérenka."\r\n"Aha, a prečo sú potom všetci ženísi v čiernom?"', 143, 3.37, 17),
	(2476, 'Malý syn pristihne rodičov v spálni akurát tesne pred vyvrcholením. Otec nestratí duchaprítomnosť a spýta sa:\r\n- No čo, Janko, čo by si chcel radšej, bračeka alebo sestričku?\r\n- Ja chcem koníka.\r\n- Ale to sa nedá.\r\n- Tak zlez, ocko! Skúsim to ja!', 263, 3.54, 17),
	(2477, '"Ujo,vy ste policajt?"\r\n"Nie, chlapče, to som sa len tak sprosto zadíval."', 76, 3.43, 17),
	(2478, 'Janko sa hrá v obývačke s vláčikom. Hovorí si:\r\n"Somári nastupovať, somári vystupovať."\r\nKeď ho počuje mamička, pošle ho do kuchyne. Po 2 hodinách jej ho však príde ľúto a dovolí mu ísť sa hrať znova. O chvíľu počuť z obývačky:\r\n"Somári vystupovať, somári nastupovať a skrz tú sliepku v kuchyni bude vlak meškať 2 hodiny."', 358, 3.47, 17),
	(2479, 'Zuzka píše list domov z detského tábora:\r\nMami, mám sa tu skvele. Počasie je krásne a spím pod stanom. Stano je fajn.', 125, 3.7, 17),
	(2480, 'Peťko v obchode so zvieratkami:\r\n- Včera som si u vás kúpil morské prasiatko. Doma som ho pustil do akvária so slanou vodou. Ono sa tam chvíľu radostne čľupkalo, potom si ľahlo na dno a zaspalo. Chcem sa spýtať, kedy sa prebudí a čo mu mám potom dať žrať?', 274, 3.79, 17),
	(2481, '"Mami, môžem nosiť podprsenku, keď už mám 15 rokov?"\r\n"Nie, Štefan."', 75, 3.53, 17),
	(2482, '- Mamička, môžem sa večer dívať na Troch mušketierov?\r\n- Nie, Zuzka, na Troch mušketierov si ešte malá.\r\n- Tak ja sa budem dívať aspoň na jedného, dobre?', 167, 2.76, 17),
	(2483, 'Učiteľka vraví deťom:\r\n- Dnes príde na besedu dvadsaťročný chlapec s Čínskej republiky aj s prekladateľom. \r\nPretože Jožko má vždy sprosté otázky, tak mu povie, aby si sadol úplne dozadu a ticho tam sedel. Diskusia prebieha už hodnú chvíľu, keď si čínsky chlapík všimne, ako Jožinko ticho sedí a tak sa spýta cez prekladateľa, či by sa ho nechcel spýtať nejakú otázku.\r\n- Ja by som len chcel vedieť, či máš jedného otca?\r\nČíňanec sa zasmeje a zažartuje s Jožinkom a povie, že nie. Jožinko na to:\r\n- Tiež som si myslel, že nemôžeš byt taky žltý iba z dvoch vajec.', 617, 3.67, 17),
	(2484, 'Jurko sa pýta otecka.\r\n- Otecko, aký je rozdiel medzi mužom a ženou?\r\n- Vieš, muž má väčšie nohy a žena menšie.\r\n- Aha, ja som vedel, že ten rozdiel je niekde medzi nohami.', 185, 3.38, 17),
	(2485, 'Dedko sa pýta vnuka:\r\n- Chceš nejakú peknú knižku?\r\n- Áno, chcem peknú šekovú knižku.', 95, 3.21, 17),
	(2486, 'Chváli sa Borisko mamičke:\r\n- Predstav si, odnaučil som babku obhryzávať si nechty!\r\n- A ako si to dokázal?\r\n- Schoval som jej zuby!', 138, 3.4, 17),
	(2487, 'V kupé vo vlaku: \r\n"Pani, prosím Vás, nech ma Váš synáčik nenapodobňuje!"\r\n"Nerob zo seba debila, Jožko!!!"', 116, 3.56, 17),
	(2488, 'Otec so synátorom kupujú nové auto. Otec si auto obzerá, hladí ho, ohmatkáva. Syn sa spýta:\r\n- Oci, prečo tak hladkáš to auto?\r\n- Vieš, ak ho chcem kúpiť, tak si ho musím dobre pozrieť.\r\nV tom syn:\r\n- Oco, myslím, že ujo poštár si chce kúpiť našu mamku!', 275, 3.38, 17),
	(2489, '"Mami, kto je to transexuál?"\r\n"Neviem, opýtaj sa tvojho uja Emílie."', 72, 3.36, 17),
	(2490, 'Ide sa Ash okúpať a oplieska ho elektrický prúd. Čo to znamená?\r\nUž sa kúpal Pikachu!', 93, 3.07, 17),
	(2491, 'Príde synček za oteckom a hovorí mu: \r\n- Oci, kúp mi samopal.\r\n- Ale čo ma tu zas otravuješ so somarinami, choď sa hrať s kamarátmi.\r\nZa chvílku príde zasa a hovorí:\r\n- Oci, kúp mi samopal.\r\n- Veď už som ti povedal, že má nemáš otravovať s takými sprostosťami, choď otravovať mamu.\r\nO 5 minút príde a hovorí:\r\n- Oci, kúp mi samopal.\r\n- Ale už mám toho dosť! Kto tu rozkazuje, ja alebo ty!?!\r\n- Ty oci, ale keby som mal samopal...', 460, 3.24, 17),
	(2492, 'Pani učiteľka sa  pýta Jožka:\r\n- Aké máte doma zvieratá? \r\n- Doma máme psa, mačku a mrazené kurča.', 109, 3.23, 17),
	(2493, '- Mamička, prečo sa maľuješ?\r\n- Aby som bola pekná.\r\n- A prečo nie si?', 76, 3.56, 17),
	(2495, 'Vnúčik: - Babka postav sa na chvíľu.\r\nBabka: - A prečo?\r\nVnúčik: - Lebo ocko povedal, že sedíš na peniazoch.', 118, 4.01, 17),
	(2496, '- Oci, je červené more naozaj červené?\r\n- Janko, to nemáš ľahšiu otázku?\r\n- Tak dobre.Kedy zomrelo Mŕtve more?', 120, 3.74, 17),
	(2497, 'Pýta sa synček otecka:\r\n- Ocko, môže byť Boh mužom aj ženou?\r\n- Áno a dokonca aj v jednej osobe.\r\n- Ocko, môže byť Boh aj homosexuál aj heterosexuál?\r\n- Áno synček a dokonca aj v jednej osobe naraz.\r\n- Ocko a môže byť Boh aj biely aj čierny?\r\n- Samozrejme synček, keď chce, tak môže.\r\n- Ja som vedel, že Micheal Jackson je Boh.', 351, 3.36, 17),
	(2498, 'Príde malý Janko domov a pýta sa mamičky:\r\n"Ako som prišiel na svet ???"\r\n"No predsa, priniesol ťa bocian."\r\n"A ocko ??"\r\n"Tiež ho priniesol boncian."\r\n"A starká ??"\r\n"No tiež."\r\nJanko odíde do izby, niečo napíše do zošita a ide hrať futbal. Mamičke to nedá vojde do izby, otvorí zošit a číta: \'V našej rodine sa už 70 rokov nikto s nikým nemiloval.\'', 374, 3.34, 17),
	(2499, 'Príde malý Jurko do obchodu a pýta sa:\r\n- Teta, máte mak?\r\n- Áno máme, Jurko, máme.\r\n- Tak sa ním posyp ty buchta!', 122, 3.42, 17),
	(2500, 'Móricko píše Ježiškovi:\r\n"Milý Ježiško, mám ťa rád a dúfam, že aj ty mňa. Dones mi na Vianoce motorku."\r\nOn mu odpíše:\r\n"Nie, to je drahé."\r\nMóricko mu opäť píše:\r\n"Mám narodeniny hneď po vianociach dones mi motorku."\r\nOn mu odpíše:\r\n"Nie, to je drahé."\r\nMóricko sa poobzerá po izbe a uvidí Pannu Máriu.\r\nA píše:\r\n"Zajal som tvoju matku, výkupné je motorka."', 393, 3.25, 17),
	(2501, 'Na pieskovisku dvaja chvalenkari:\r\n- Môj otec je historik. Ha!\r\n- A moja mama hysterička. He!', 95, 2.49, 17),
	(2502, 'Zhovárajú sa dvaja chlapci:\r\n- Vy sa pred obedom modlíte?\r\n- Nie, naša mama varí dobre!', 92, 3.22, 17),
	(2503, 'Janko píše domov rodičom z tábora:  \r\n"Mám sa tu dobre, varia nám skvele,vychovávatelia sú fajn. PS: Napíšte mi, čo je to malária."', 143, 3.38, 17),
	(2504, 'Janko a Marienka na pieskovisku. Janko hovorí:\r\n- My máme dom. \r\nMarienka na to: \r\n- A my máme chatu pri mori. \r\nJanko opäť oponuje:\r\n- A my máme auto. \r\nMarienka sa zasa vynašla a hovorí:\r\n- A my máme aj motorku.\r\nJanko po dlhom rozmýšľaní o tom, čo on má a ona nie, hovorí:\r\n- A ja mám pipíka.\r\nNa to Marienka pohotovo odvetí:\r\n- Ja, keď budem veľká, budem mať koľko chcem.', 399, 3.48, 17),
	(2505, 'Karolko píše Ježiskovi: "Celý mesiac budem dobrý, keď mi pošleš moped.". Hneď si pomyslí, že celý mesiac to nevydrží. Roztrhá list a napíše nový: "Týždeň budem dobrý, keď mi pošleš moped." Znovu popremýšľa. Veď týždeň asi nevydržím. Roztrhá list a napíše nový: "Jeden deň budem doby, keď mi pošleš moped." Znovu premýšľa a uvedomí si, že on nevydrží byť dobrý ani minútu a už vôbec nie celý deň! Pozrie na stenu, uvidí obraz Panny Marie. Chytí ho, zvesí a zavrie do skrine. Píše nový list: "Ježiško, zajal som tvoju matku. výkupné je moped!"', 607, 3.42, 17),
	(2506, 'Evička pije z kaluže vodu. Pristaví sa pri nej Janko a hovorí: \r\n- Nepi tu vodu! Je v nej kopa bacilov a ochorieš.\r\n- Neboj sa, Janko, predtým som ich prešla bicyklom.', 174, 3.26, 17),
	(2507, 'Príde chlapček po dlhom čase opäť do škôlky a učiteľka mu vraví:\r\n- Miško, vitaj!\r\nMiško na to namrzene: \r\n- Ja nie som Miško Vitaj, ja som Miško Kováčik.', 170, 2.91, 17),
	(2508, '- Otecko, počula som, že veľké ryby jedia sardinky. \r\n- To je pravda. \r\n- A ako si otvárajú konzervy? ', 108, 3.11, 17),
	(2509, 'Syn hovorí mame:\r\n- Mami, horí lampa.\r\n- Nehovorí sa horí lampa, ale lampa svieti.\r\n- Tak mami, už nám svietia aj záclony.', 129, 3.82, 17),
	(2510, '- Laco, ako si mohol v slove kurča dať na u dĺžeň?\r\n- Mal som v pere veľa atramentu.', 90, 3.12, 17),
	(2511, 'Príde malý Janko domov a pýta sa ocka:\r\n"Ocko, čo je to bizón?"\r\n"Vieš synček, to je taká blbá ryba."\r\n"Ale nám pani učitelka povedala, že behá po lese."\r\n"Veď hovorím, že je blbá!', 197, 3.41, 17),
	(2512, 'Príde dievčatko do obchodu.\r\n"Prosím vás dajte mi cigarty."\r\nPredavač sa jej pýta:\r\n"Tebe, veď ti ešte tečie mlieko po brade???"\r\nDievča mu odpoveda:\r\n"To nie je mlieko!!!"', 182, 3.47, 17),
	(2513, 'Anička sa pýta ocka:\r\n"Ocko môžem dnes s tebou spať?"\r\n"Áno, ale sa nesmieš pozrieť pod paplón."\r\n"Dobre."\r\nOtecko ráno vstane a pýta sa Aničky:\r\n"Čo si tam večer robila?"\r\nOna na to:\r\n"Hrala som sa s bábikou vyzliekla som ju obliekla som ju vyzliekla som ju obliekla som ju....nakoniec ma opľula tak som jej odtrhla hlavu!"', 340, 3.36, 17),
	(2514, 'Mamička ide s dcérenkou na nuda pláž a dcérenka sa pýta: \r\n"Mami čo to majú tí ujovia medzi nohami?"\r\nMamička sa celá začervená a odpovedá: \r\n"Vieš to sú také píšťalky."\r\nO dve hodiny príde dcérenka za mamičkou a hovorí: \r\n"Mami, ale tie píšťalky nepískajú."', 287, 3.7, 17),
	(2515, 'Kedy si Móricko začne robiť domáce úlohy?\r\nKeď budú mať sexuálnu výchovu.', 83, 3.29, 17),
	(2516, 'Príde Janko domov zo školy a vraví oteckovi:\r\n- Ocko, ocko, dnes sme celú hodinu telocviku stáli na jednej nohe.\r\n- Na jednej nohe ako bociany?\r\n- Nie ocko, ako debili.', 173, 3.34, 17),
	(2517, 'Stretne sa 12-násť ročná s 18-násť ročnou v šatni pri prezliekaní a pýta sa:\r\n"Čo to máš medzi nohami také chlpaté?"\r\n"Keď dorastieš budeš mať aj ty."\r\n"Ja len či ti to nezavadzia pri súloži?"', 214, 3.69, 17),
	(2518, 'Rodičia odídu do divadla a nechajú doma 3 ročného, 2 ročného a 1 ročného syna. Len čo zavrú za sebou dvere 3 ročný hovorí: \r\n"Zahrajme si mariáš". \r\n2 ročný na to: \r\n"Kašlem ti na mariáš, poďme za ženami". \r\n1 ročný: \r\n"Možeme ísť do zadku, ja neviem chodiť".', 288, 3.67, 17),
	(2519, 'Matka sa pýta 16 ročnej dcéry.\r\n"Bola si v kine s Janom?"\r\n"Áno,bola"\r\n"Dúfam,že ťa neobťažoval?"\r\n"Nie"\r\n"Dúfam,ťe ťa ani nebozkával?!"\r\n"Nie"\r\n"A o čom bol vlastne ten film?"\r\n"Vieš,že ja ani neviem,ja som sa tak smiala,až som Jankovi ruku ocikala!!"', 269, 3.32, 17),
	(2520, 'Večer pred spaním číta mamička dcérke, aby zaspala, na dobrú noc rozprávku. Po polhodine jej dcérka hovorí:\r\n- Mamička, nemohla by si si ísť čítať niekde inde? Ja chcem už späť!', 196, 3.41, 17),
	(2521, 'Niekto zvoní Novákovi pri dverách, ten otvorí a vidí postihnutého chlapca, ktorý spustí:\r\n"Nadácia Dúha, pomôžte mentálne retardovaným deťom. Za 10 korún umývame okná."\r\n"Ale ja mám okna umyté."\r\n"Ujo, pomôžte retardovaným deťom."\r\n"No dobre."\r\nPustí ho dnu a 10 minút znova niekto zvoní pri dverách:\r\n"Nadácia Dúha, za 10 korún umývame okná, pomôžte retardovaným deťom..."\r\n"Ale ja tu už jednáho od vás mám."\r\n"To som ja, ja som vypadol..."', 482, 3.5, 17),
	(2522, 'Dedo sa pýta malého dievčatka:\r\n- Čo by si mi dala, keby som ti kúpil peknú bábiku?\r\n- To, čo môže dať žena mužovi.\r\n- Čo? Taká malá a už sa rozdávaš.\r\n- Ale, len sa nebojte dedo. Kým vám sa postaví, ja zatiaľ dorastiem.  ', 245, 3.62, 17),
	(2523, 'Škôlkarka sa pýta pani učiteľky:\r\n- Pani učiteľka, môže mať 5-ročné dievčatko babätko? \r\n- Nie moja, nemôže.\r\n- Tak chlapci, môžeme pokračovať!', 163, 3.4, 17),
	(2524, 'Príde chlapček k mäsiarovi a pýta sa:\r\n- Ujo, máte bravčovú hlavu?\r\n- Mám.\r\n- Tak vám treba!', 101, 3.44, 17),
	(2525, '- Tá stokorunáčka je falošná, chlapče. Za tú si nič nekúpiš.\r\n- Ale ja nič nechcem kupovať, ujo. Mňa poslal otec aby som ju rozmenil...', 148, 3.13, 17),
	(2526, 'Syn sa pýta otca:\r\n- Oci, prečo je mŕtve more mŕtve?\r\n- Nemôžeš mi dať lepšiu otázku?\r\n- Tak dobre. Kedy zomrelo?', 123, 3.23, 17),
	(2527, '"Otecko, prečo stvoril pánbožko najskôr Adama?"\r\n"Vieš, synak, ešte mal kopu roboty a nechcel, aby mu do toho nejaká baba kibicovala."', 141, 3.33, 17),
	(2528, '- Daj mi ešte jeden cukrík!\r\n- Nedám ti. Do obeda už žiadne sladkosti!\r\n- Ak mi nedáš cukrík, prezradím psovi, kde si schovala klobásky!', 146, 3.11, 17),
	(2529, '- V škole klamú! - zahlási večer Jožko\r\n- Prečo si myslíš, že vás klamú? - pýta sa matka\r\n- Lebo včera učiteľ tvrdil, že voda je bez zápachu, bez chuti, bez farby a že sa nedá rozoznať. To nie je pravda! Nalial som dnes otcovi do piva dva deci vody a on hneď spoznal...', 290, 3.22, 17),
	(2530, 'Jožko, šušleš?\r\nŠem-tam...', 31, 3.44, 17),
	(2531, 'Janko, už nemôžeš spať so mnou v posteli, si už veľmi starý. \r\nAle oco je ešte starší a on môže?', 109, 3.32, 17),
	(2532, 'Jožinko príde domov zo škôlky a hovorí mamičke:\r\n- Mami, deti v škôlke sa mi smejú, že mám veľké zuby.\r\n- Ale Jožinko, veď to nie je pravda! Len zatvor ústa, lebo potrháš koberec!', 197, 3.46, 17),
	(2533, '"Chlapček, choď ďalej od tej vodičky, veď do nej môžeš spadnúť."\r\n"Drž hubu ty stará krava."\r\n"Pankhart jeden že ťa mater nepotratila."', 149, 3.31, 17),
	(2534, 'V byte zvoní telefón. Zdvihne ho malý chlapec. Clapec sa ozve šeptom:\r\n"prossííím..."\r\n"Daj mi otca."\r\n"nemôžem"\r\n"prečo?"\r\n"má veľa roboty"\r\n"tak mi daj mamu"\r\n"nemôžem"\r\n"prečo?"\r\n"má veľa roboty"\r\n"tak kto je ešte u vás"\r\n"hasiči"\r\n"tak mi jedného daj k telefónu!"\r\n"nemôžem"\r\n"tak kto je ešte u vás?"\r\n"policajti"\r\n"tak mi jedného daj k telefónu"\r\n"nemôžem majú veľa roboty"\r\n"a čo to vlastne robia?"\r\n"Hľadajú ma!"', 454, 3.75, 17),
	(2535, 'V škole sa pýta učiteľka:\r\n- Povedz, Miško, čo sa dáva do jaterníc?\r\n...\r\n- Ty nevieš? Veď si mäsiarov syn.\r\n- Však preto. Keď vyzradím, otec má zabije.', 167, 3.36, 17),
	(2536, 'Tehotná mamička sa pýta synka, čo by si prial k vianociam, či bračeka alebo sestričku.\r\n- No, ak by ti to neroztrhlo pipinu, tak radšej sánky.', 151, 3.82, 17),
	(2537, 'Anička sa vráti z ihriska a pýta sa matky:\r\n- Mami, môžu mať deti deti?\r\n- Ale Anička, veď vieš, že nie.\r\nAnička sa vykloní z okna a zakričí:\r\n- Janko, choď domov, nič z toho nebude!', 198, 3.51, 17),
	(2538, '- Dedo, máš ešte zuby ?\r\n- Nie, prečo vnúčik ?\r\n- Preto, aby si mi mohol postrážiť orechy !', 100, 3.17, 17),
	(2539, 'Nová učiteľka zoológie sa na hodine pýta Móricka:\r\n- Chlapče, od akého vtáka je toto vajce ?\r\n- Neviem.\r\n- A toto?\r\n- Neviem.\r\n- A toto?\r\n- Takisto neviem.\r\n- Zle, veľmi zle, ako sa voláš?\r\nMóricko si stiahne trenírky a hovorí:\r\n- Skúste uhádnuť podľa vajec!', 277, 3.8, 17),
	(2540, 'Ide Peťko do mäsiarstva a pýta sa:\r\n"Máte prasačiu hlavu?"\r\n"Áno mám, prečo?"\r\n"Tak vám treba!"', 104, 3.3, 17),
	(2541, 'Vzala pani učiteľka deti na exkurziu na stavbu a ako naschvál práve vtedy spadol z lešenia robotník a na mieste bol mŕtvy. Po príchode späť do triedy, pustili sa do rozoberania tohto prípadu.\r\n- Povedz nám Anička, prečo tento ujo spadol?\r\n- Nevedel nič o bezpečnosti práce.\r\n- A ty Miško?\r\n- Určite mal vypité.\r\nVtom sa postaví Móricko.\r\n- Nie, on spal s mojou mamou!\r\n- Prečo si to myslíš ?\r\n- Počul som ako kričal "Chlapče, jebem ja tvoju mater, netras tým lešením!"', 499, 3.61, 17),
	(2542, 'Janko sa pýta mamičky ako prišiel na svet. Mamička mu povie:\r\n"Vieš Janíčko to sme sa s oteckom večer tak trošku pocukrovali a potom si ráno prišiel na svet ."\r\nJanko si večer ľahol a celý sa posypal cukrom. Ráno sa zobudil a mal plnú posteľ mravcov.\r\n"Keby ste neboli moje deti tak vás všetky pozabíjam."', 325, 3.62, 17),
	(2543, '- Mamííí?\r\n- Prosím.\r\n- Opuchol mi prst!\r\n- Ako si na to prišiel?\r\n- Nezmestí sa mi do nosa.', 98, 3.19, 17),
	(2544, '"Tata!Ja chcem koňa na Vianoce."\r\n"Ale Jožko koňa predsa nemôžeme kúpiť."\r\n"Ja chcem koňa!"\r\n"Dobre teda dostaneš koňa,ale po častiach.\r\n"A ako po častiach?"\r\n"No tento rok dostaneš konský penis!"', 210, 3.06, 17),
	(2545, '"Ahoj, Jožko môžem hovorit s ockom?"\r\n"Otecko je veľmi zaneprazdnený."\r\n"Ale to je veľmi dôležité."\r\n"Ocko je naozaj veľmi zaneprázdnený."\r\n"A mamička je doma?"\r\n"Áno, a sú tu aj policajti a hasiči."\r\n"A čo dočerta  všetci robia?"\r\n"Oni ma hľadajú."', 270, 2.96, 17),
	(2546, 'Na rodinnej oslave požiadajú malého Janka, aby im predniesol nejakú peknú rýmovačku. Janko spustí:\r\n- Kúpali sa chlapci z Rajca, voda im siahala až po kolená.\r\n- Janko, ale to sa nerýmuje.\r\n- To sa bude, keď voda stúpne.', 234, 3.57, 17),
	(2547, '- Peťko, ty papáš ako prasiatko. Vieš vôbec, čo je to prasiatko?\r\n- Áno, pravdaže viem, mláďa veľkej svine.', 118, 3.51, 17),
	(2548, 'Matka sedí na posteli svojej 5-ročnej dcérky a číta jej rozprávku na dobrú noc. Zrazu sa malá ozve:\r\n- Mami, nemohla by si si to čítať trochu tichšie? Mala som v škôlke dnes skutočne ťažký deň a chcela by som teraz konečne späť.', 250, 3.25, 17),
	(2549, '- Janko, prečo nechcú tie zápalky horieť?\r\n- Neviem, keď som ich skúšal, horeli všetky.', 95, 3.15, 17),
	(2550, 'Príde malý Ferko s kamarátom Jožkom za svojou 90 ročnou babičkou: \r\n- Baaabiii, a ty môžeš mať deti?\r\nBabička s úsmevom:\r\n- Nie Ferko, ja predsa nemôžem mať deti.\r\nFerko sa otočí na Jožka a zvolá:\r\n- No vidíš, hovoril som ti, že babka je SAMEC!', 266, 3.41, 17),
	(2551, 'Jožko sa vráti zo školy a mamička sa ho pýta:\r\n- Páčilo sa ti prvý krát v škole?\r\n- Áno.\r\n- Skúšalo sa?\r\n- Áno.\r\n- Prihlásil si sa?\r\n- Áno.\r\n- Vyvolala ťa pani učiteľka?\r\n- Áno.\r\n- A vedel si?\r\n- Áno.\r\n- A čo sa ťa pýtala?\r\n- Kto si prdol?', 263, 3.93, 17),
	(2552, 'V škole pred Vianocami.Deti hovoria ,čo by chceli pod stromček.Janko:\r\n"Autíčko."\r\n"Pekné želanie.A ty Zuzka?"\r\n"Bábiku."\r\n"Tiež pekné a čo ty Dezko?"\r\n"Ja by som chcel AIDS!"\r\n"Pane bože,a prečo?"\r\n"Lebo odo mňa ho dostane sestra, od sestry otec, od otca mama a od mamy sused.Sviňa,šliapol mi na vláčik!"', 323, 3.43, 17),
	(2553, 'Na rohu fajčí päťročný chlapec cigaretu. Ide okolo babička a pýta sa ho:\r\n- Chlapče, to tu vždy takto fajčíš?\r\n- Nie babi, len keď som opitý.', 156, 3.33, 17),
	(2554, '"Mama, môžem vylízať misu?"\r\n"Ale nie miláčik radšej to spláchni!"', 74, 4.22, 17),
	(2555, '- Martin, prečo si včera odišiel keď ma Mišo bil?\r\n- Nemohol som sa prizerať, ako bijú môjho najlepšieho kamaráta.', 124, 3.28, 17),
	(2556, 'Ocko sa pýta synčeka: \r\n- Čo robíš?\r\n- Papkám lepidielko!\r\n- Ale to nesmieš!\r\n- Uuuummmmm....', 100, 3.42, 17),
	(2557, '- Mamááá, mamááá, odkiaľ sa berú deti?\r\n- Veď už toľkokrát som ti hovorila, že ich nosí bocian.\r\n- To viem, ale kto pretiahol bociana?', 148, 4.06, 17),
	(2558, 'Mala Katka sa pýta mamičky:\r\n- Mami ako sa robia bábätká?\r\nPo chvíľke uvažovania matka odpovie:\r\n- No vieš Katka, otecko dá mamičke vzácne semienko, z ktorého jej v brušku narastie babätko.\r\nKatka:\r\n- A to semienko musíš prehltnúť?\r\nMatka:\r\n- Nooo...len keď chcem nové topánky.', 299, 3.51, 17),
	(2559, 'Sedia deti - prváci v škole na hodine Slovenského jazyka a učiteľka sa pýta: \r\n- Kto mi povie, čo sa dá zjesť, dostane včeličku.\r\nPrihlási sa Janko a hovorí:\r\n- Jablko.\r\n- Janko výborne, máš včeličku.\r\nPrihlási sa Zuzka a hovorí: \r\n- Chlieb.\r\n- Zuzka výborne, máš včeličku.\r\nPrihlási sa JOŽKO a hovorí:\r\n- Svetlo.\r\nUčiteľka zmeravela a hovorí:\r\n- Vysvetli to Jožko.\r\n- Viete, pani učiteľka, sedel som v detskej izbe a počul som mamu ako hovorí otcovi zhasni svetlo a daj mi ho do úst.', 521, 4.27, 17),
	(2560, 'Pani učiteľka príde ráno do triedy k prváčikom a vzhľadom na to ,že cez noc prvykrát nasnežilo,opýta sa či by jej niekto vedel zarecitovať básničku o zime. Všetky deti sa prihlásia a odrecitujú,len malý Janko nie.\r\nPani učiteľka ho vyvolá. Janko sa spočiatku ošíva,ale nakoniec spustí:\r\n"Vonku padá sniežik,\r\nvločka míňa vločku,\r\na na našej streche ,\r\nkocúr šuká mačku."\r\nPani učiteľka sa zhrozí a dá na domácu úlohu Jankovi básničku prerobiť a hlavne skrátiť.Na druhý deň Janko príde a odrecituje:\r\n"Vonku padá sneh , \r\na ja ho kašlem nech."', 595, 3.34, 17),
	(2561, 'Anička a Janko sa hrajú v piesočku.Janko jej dá ruku pod sukničku a pýta sa:\r\n"Anička, ty si chlapček?"\r\n"Nie, kakám."', 127, 3.58, 17),
	(2562, 'Bolo raz jedno dievčatko a volalo sa Evička. Raz tak išla lesom, keď z krovia vyskočil chlapík a začal z nej strhávať šaty. Ale Evička sa iba smiala, lebo vedela, že mu budu malé.', 192, 3.26, 17),
	(2564, '- Spávajú ryby? - pýta sa Jurko Petra.\r\n- Jasné! Čo myslíš, kto vymyslel vodnú posteľ?', 95, 3.43, 17),
	(2565, 'Ferinko príde do kúpelne a tam vidí malého čierneho Azuritka.\r\nOpýta sa ho :\r\n" A ty si kto?"\r\n"Ja som Azuritko a som všade tam kde je mäkučko."\r\n"Aha, a budeš tu, keď sa vrátim?"\r\n"Čo si ukradnem práčku a idem preč."', 233, 3.26, 17),
	(2566, 'Janko vraví mamičke:\r\n- Idem si natrhať čerešne.\r\n- Ale veď je zima!\r\n- To nič! Dám si rukavičky.', 106, 3.19, 17),
	(2567, 'Sedí strašně hrbatý pán na lavičce a najednou vidí před sebou ležet Kamelky. Chce je sebrat, ale vůbec mu to nejde. Najednou kolem běží malá holčička sebere ty Kamelky, podá je pánovi a povídá:\r\n"Pane tady vám vypadl občanský průkaz."', 258, 3.21, 17),
	(2568, '5-ročný Janko sa pýta rovnako starej Marienky:\r\n"Marienka vydáš sa za mňa?"\r\n"A dokážeš uživiť ženu s piatimi bábikami?"', 133, 3.12, 17),
	(2569, 'Chlapci si pozerajú erotické časopisy. Odrazu sa jeden rozplače. Druhý sa ho pýta, prečo plače. \r\n- Preto, lebo mama mi pohrozila, že ak si budem pozerať sprosté časopisy, tak skameniem. A ono sa to už začína!', 224, 3.4, 17),
	(2570, 'Pani učiteľka je s deťmi v saune, a Móricko sa jej pýta:\r\n"P.U. čo to máte medzi nohami ?"           \r\n"Mačičku, Móricko."\r\n"A prečo sa nehýbe?"\r\n"Ona spí."  \r\n"Spí? Mŕtva je, preto tak smrdí!"', 209, 3.18, 17),
	(2571, 'Pýta sa Miško.\r\n- Ocko, ako som prišiel na svet?\r\n- Priniesol ťa bocian.\r\n\'Ten otec je ale hlupák\', myslí si Miško, \'má takú peknú ženu a robí to s bocianom.\'', 170, 3.17, 17),
	(2572, 'Rozhovor otecka s dcérkou:\r\n"Ociiii, ociiiii kúp mi tie topánočky čo sú vo výklade."\r\n"Zavri hubu, najprv znos korčule!"', 128, 3.24, 17),
	(2573, 'Narodilo sa dieťa. Hneď po príchode na svet sa pýta na otca. Šťastný otecko k nemu podíde, dieťa mu začne ťukať prstom do čela a vraví: "Páči sa ti to, páči sa ti to?"', 185, 3.26, 17),
	(2574, 'Malý chlapček sedí na chodníku a plače, príde k nemu dedko a pýta sa ho:\r\n- Prečo plačeš chlapče?\r\n- Je mi ľúto, že nemôžem robiť s dievčatami to, čo iní chlapci.\r\nDedko si sadne na chodník a plače tiež.', 226, 3.39, 17),
	(2575, 'Rodičia majú dve deti. Jedno riadneho pesimistu a druhé veľkého optimistu. Na vianoce chcú rodičia deti vyskúšať. Pesimistovi vykúpia obchod z hračkami a optimistovi dovezú do izby fúru konského hnoja. Zazvonia na zvonci a deti bežia do izby pozrieť darčeky. Z izby pesimistu sa ozýva plač. \r\n- Toľko darčekov, všetci mi budú závidieť, hračky sa budú kaziť a bateriek koľko ide do nich.\r\nZ izby optimistu sa ozýva smiech. Keď prídu do izby, optimista sa prehŕňa v hnojí a vraví:\r\n- Toľko hnoja, tu musí byť niekde koník.', 561, 3.87, 17),
	(2576, 'Príde pedofil pred škôlku a hovorí malému dievčatku:\r\n"Dievčatko, ak my dovolíš aby som sa dotkol tvojich vlasov, dám ti cukrík."\r\nDievčatko dovolí. Pedofil hovorí:\r\n"A ak my dovolíš dotknúť sa tvojich prsíčok dám ti čokoládu."\r\nA dievčatko mu hovorí:\r\n"Ujo, kým Vy ma pretiahnete, aj cukrovku dostanem!"', 330, 3.69, 17),
	(2577, '- Ty už sa nehráš s Jožinkom?\r\n- Hral by si sa s niekým, kto podvádza?\r\n- To určite nie.\r\n- No vidíš, ani Jožinko.', 124, 3.3, 17),
	(2578, 'Mladomanželia si chcú vyraziť večer do kina. Aby uspali svoje malé dieťa pustia mu z platne rozprávku a odídu. Keď sa po troch hodinách vrátia z kina domov tak už v chodbe počujú silné búchanie a výkriky\r\n"Áno, chcem, áno, chcem... áno, chcem..."\r\nA tak sa ponáhľajú do detskej izby kde vidia svoje malé dieťa ako z celou zakrvavenou hlavou búcha o stenu a kričí:\r\n"Áno, chcem..."\r\nA z gramofónu sa ozýva:\r\n"Chcete počuť rozprávku... chcete počuť rozprávku... chcete počuť rozprávku..."', 526, 3.41, 17),
	(2579, '- Stará mama, je to pravda, že za zlo sa máme odplatiť dobrom?\r\n- Je to pravda, vnúčik môj.\r\n- Tak mi daj dvadsať korún. Pred chvíľou som ti rozbil okuliare.', 168, 3.1, 17),
	(2580, 'Pod vianočným stromčekom rozbaľujú Janko a Marienka darčeky a Marienka hovorí:\r\n"Ja som dostala bábiky, šatôčky, domčeky a ty len jedno auto. Ha ha ha..."\r\nJanko:\r\n"Niekto má len jedno auto, niekto zasa leukémiu."', 227, 2.96, 17),
	(2581, '"Chlapček, koľko máš rokov?"\r\n"Teraz mám päť, ale ocko mi sľúbil, že keď budem dobrý, tak o rok budem mať šesť."', 127, 3.33, 17),
	(2582, '- ... a potom Snehulienka spala a spala. A prestaň sa ma, Dežko, neustále vypytovať na to, s ktorým trpaslíkom.', 117, 3.13, 17),
	(2583, 'Pýta sa indiánske dieťa otecka:\r\n"Oci, prečo sa moja sestrička volá Zapadajúce Slnce?"\r\n"No, vieš, keď sme s mamičkou tvoju sestričku ... ehm, no... robili, tak práve slniečko zapadalo, nám sa to s mamičkou veľmi páčilo, tak sme ju tak pomenovali."\r\n"A oci, prečo se môj braček volá Májový Deň?"\r\n"No, to je preto, že keď sme robili tvojho bračeka, tak bol práve máj, krásne teplo, rozkvitnutá lúka - tak sme mu dali také meno. Máš ešte nejaké otázky, Prasknutá Guma?"', 508, 3.18, 17),
	(2584, 'Ujo sa pýta chlapca:\r\n"Ako sa voláš?"\r\n"Tak ako otec."\r\n"A ako sa volá tvoj otec?"\r\n"Tak ako ja."\r\n"A ako sa voláte obaja?"\r\n"Rovnako."', 140, 3.14, 17),
	(2585, 'Pepíčka pošle maminka nakoupit, aby koupil vydru. Jenže Pepíček říká místo "r","v". Tak jí koupí a jde po ulici okolo policajtů a policajti se u něho zastaví a ptaj se ho:\r\n"Co to tady smrdí?"\r\nA Pepíček odpoví:\r\n"Vydva."', 240, 3.13, 17),
	(2586, '- Mamí, koľko pasty je v zubnej paste?\r\n- A čo ja viem.\r\n- Ja to viem. Od gauču po televízor.', 98, 3.32, 17),
	(2587, 'Ide 13ročný chlapec po ceste a pred sebou si kope mŕtvu žabu.\r\nPríde pred bordel, zazvoní a hovorí bordelmame:\r\n"Chcem ženu."\r\nBordelmama sa zasmeje:\r\n"Ale chlapče, veď máš sotva 15 rokov, choď domov."\r\nChlapec vytiahne z vrecka 100 dolárov a bordelmama ho pozve ďalej. Nasleduje druhá mladíkova požiadavka:\r\n"Žena s ktorou budem súložiť, musí mať aids."\r\nBordelmama sa zarazí, ale po ďalšej 100dolárovke sa opať nechá presvedčiť.Chlapec si zasúloži a spokojne odchádza domov.Bordelmame to nedá a pri odchode sa chlapca spýta:\r\n"Chlapče, preboha, vieš mi to vysvetliť, celý život máš pred sebou a teraz aids,veď umrieš."\r\nChlapec sa posmeje a vysvetlí:\r\n"Prídem domov, posúložím vychovávateľku, dostane aids,príde domov otec, posúloží vychovávateľku, dostane aids,príde mama z práce, otec ju posúloží, dostane aids a ráno príde poštár posúloží mamu , dostane aids a zomrie.A to má za to, že mi dnes ráno zabil žabu."', 991, 3.44, 17),
	(2588, 'Potkají se dve pětileté holčičky na pískovišti.\r\nJedna z nich šišlavě povídá:\r\n"Tak si predstav, včera jsěm našla prezervativ u transformátoru."\r\n"A čo je to ten transformátor!"', 195, 2.98, 17),
	(2589, 'Hovorí Janko učiteľke:\r\n- Zložil som pesničku o sexe.\r\n- Hm? Dobre, Janko, tak si ťa vypočujeme.\r\n- Ráno skoro vstávam, idem do školy, učím sa, potom sa trochu hrám, opäť sa učím, idem spať a takto stále dookola...\r\n- No dobre - pýta sa učiteľka - a kde je tu sex?\r\n- Pesnička sa volá "Jebem ja taký život".', 333, 3.51, 17),
	(2590, 'Janko ide opäť spať s mokrou hlavou a otecko ho napomína:\r\n- Janíčko, veď nemusíš dávať každý večer pusu na dobrú noc našej zlatej rybke!', 153, 2.96, 17),
	(2591, '- Ocko, čo je to perverzita?\r\n- Tomu ešte nemôžeš rozumieť. Poď mi, prosím ťa, zapnúť podprsenku.', 108, 3.08, 17),
	(2592, 'Chlapček sa hrá na piesočku s dievčatkom, po chvíli príde chlapček ku dievčatku, pozrie sa jej pod sukienku a udivene povie:\r\n"Anička, ty si chlapček?"\r\n"Nie Janko, ja kakám."', 186, 3.38, 17),
	(2593, 'Janko po prvý raz vidí páva:\r\n- Ocko, pozri, tá sliepka práve kvitne!', 74, 4.04, 17),
	(2594, '- Chcel by som ti dať darček na meniny, ocko.\r\n- Ďakujem synček, ale najmilším darom by pre mňa boli tvoje dobré známky v škole.\r\n- Už je neskoro! Kúpil som ti kravatu.', 180, 3, 17),
	(2595, 'Janko sa vychvaľuje svojmu kamarátovi:\r\n- My máme auto od Škody a televízor od Daewoo.\r\nJaro sa pripojí:\r\n- My máme žehličku od Ety a bračeka od podnájomníka.', 170, 2.81, 17),
	(2596, 'Chlapček vojde do mäsiarstva:\r\n- Pán mäsiar, máte bravčový jazyk?\r\n- Mám.\r\n- Tak mi s ním oblížte riť.\r\nChlapček vybehne z obchodu, mäsiar sa rúti za ním. Už už ho dobieha, keď ide oproti pán Kohn.\r\n- Čo sa robí? -pýta sa.\r\nMäsiar odpovedá:\r\n- Ten malý mi povedal, že mu mám vylízať riť!\r\nKohn len pokýva hlavou a hovorí:\r\n- A to máte tak napilno?', 381, 3.24, 17),
	(2597, 'Mama napomína syna:\r\n- Nesmieš ťahať kocúra za chvost!\r\n- Veď ja ho len držím, on sa ťahá.', 100, 3.18, 17),
	(2598, 'Jožko dostal nový bicykel. Predvádza sa na ňom otcovi, ktorý sa naňho pozerá z okna. Jožko kričí:\r\n- Aha ocko, bez rúk!\r\nPo chvíli:\r\n- Aha ocko, bez nôh!\r\nA potom:\r\n- Aha ocko, bež žubov!', 202, 3.12, 17),
	(2599, 'Mala Anička ide okolo spálne, nakukne cez kľúčovú dierku a vraví:\r\n- A to mi mamička vraví, že si cmúľam palec.', 123, 3.48, 17),
	(2600, 'Janko s Ferkom sa hrajú v pieskovisku na vojnu. V najťažších bojoch už Ferko leží na zemi.\r\nJanko mu po 10 minútach búchania železnou palicou vraví: \r\n- Už si mal byť dávno mŕtvy.\r\n- Ja som tank.', 211, 3.3, 17),
	(2601, '"Mamí, horí nám lampa."\r\n"Nehovorí sa horí ale svieti."\r\n"Mamí, svietia aj záclony!"', 91, 3.47, 17),
	(2602, 'Mala Marienka dáva spať svoje bábiky. \r\n- Marienka, ale veď bábiky sa ešte neumývali - upozorňuje ju babka. \r\n- Ja viem, ale chcem, aby bábiky mali lepší život ako ja.', 179, 3.24, 17),
	(2603, 'Chlapec príde domov mokrý a mamička sa ho pýta:\r\n- Prečo si taky mokrý?\r\n- Hrali sme sa s chalanmi na psíkov.\r\n- Nechápem.\r\n- Hrali sme sa na psíkov a ja som bol strom.', 177, 2.7, 17),
	(2604, 'Sú dvaja bratia. Jeden je normálny a druhý je maximálne postihnutý. Čo čert nechcel ten normálny umrie. Postihnutý pribehne za mamou a pýta sa:\r\n"Mamička kde je môj brat?"\r\nMamička nevie ako mu odpovedať a tak ho pošle za otcom. Ten sa zachová ako mama a pošle ho za babkou. Babka si tiež nevie poradiť a tak ho pošle za dedkom. Dedko nepochopí že to nemusí chápať a pošle ho do vedľajšej izby. Tu leží jeho brat v truhle a okolo nej sú sviečky. Dement 3-krát obehne okolo truhly pozrie na ňu buchne sa do čela a zaspieva Happy birthday to you.', 579, 2.84, 17),
	(2605, 'Rozprávajú sa dvaja sedemroční:\r\n- My sa každý deň pred jedlom modlíme. A čo vy?\r\n- My nemusíme, naša mama vie variť.', 129, 3.4, 17),
	(2606, 'Príde chlapec do reštaurácie a pýta sa čašníčky: \r\n- Dobrý deň, prosím vás, máte pizzu?\r\n- Nie, ľutujem.\r\n- To je zaujímavé. A prezzo?', 150, 3.07, 17),
	(2607, 'V detskom tábore sa blíži obed a deti sú strašne hladné.Očakávane sa ozve z rozhlasu:\r\n- Obedy sa podávajú pri východnej bráne!\r\nVšetky deti sa rozbehnú tak rýchlo ako len vládajú a keď pribehnú, z rozhlasu sa ozve:\r\n- Omyl, obedy sa podávajú pri južnej bráne!\r\nDeti sa už od hladu nevedia ani pohnúť, ale zúfalo dobehnú k južnej bráne, keď sa zase ozve rozhlas:\r\n- Pre neustále pobehovanie, sa obedy rušia!', 440, 3.47, 17),
	(2608, 'Rodičia sa večer ponáhľajú do divadla a tak pustia svojmu synčekovi gramofón, aby po dopočúvaní platne išiel späť. Vrátia sa o dve a pol hodiny, dieťa bije hlavou o stenu a kričí:\r\n- Chcem! Chcem! Chcem!\r\nA z gramofónu sa ozýva: "Chcete počuť rozprávku? Chcete počuť rozprávku? Chcete počuť rozprávku? ..."', 334, 3.16, 17),
	(2609, '- Pán šofér, zastavte, tamagočimu je zle!', 45, 2.93, 17),
	(2610, 'Príde Janko domov a mamička sa ho pýta:\r\n- Janko, od čoho máš tu modrinu na čele?\r\n- Od premýšľania.\r\n- Ako to?\r\n- Myslel som, že Karol ma tým kameňom netrafí.', 173, 3.58, 17),
	(2611, 'Janko píše list z tábora domov:\r\nMám sa skvele. Mám tu veľa kamarátov a kamarátiek a varia tu dobre. Nemusíte sa o mňa báť. S pozdravom, váš Janko.\r\nPS: A čo je to epidémia?', 189, 3.04, 17),
	(2612, 'Chlapček ciká o múr a zrazu ho zastaví policajt. \r\n- Chlapček ak budeš aj naďalej cikať, tak ti tvojho pindíka odrežem. \r\n- Dobre ujo policajt. \r\nZrazu ide chlapček okolo dievčatka a vidí ju cikať nad kanálom. \r\n- Dievčatko, ale to nemôžeš, lebo ujo policajt ti odreže pindíka. \r\nNadvihne jej sukňu a povie:\r\n- Aha on tu už u teba bol, že?', 363, 3.05, 17),
	(2613, 'Sedia traja jasličkári na šerblíkoch a zhovárajú sa. Prvý hovorí: \r\n- Pôjdeme do balu a zobeleme baby. \r\nDruhý hovorí: \r\n- Zobeleme aj gitalu.\r\nA ten tretí sa pripojí: \r\n- Do liti pôjdeme, keď nevieme chodiť.   ', 227, 4.08, 17),
	(2614, 'Malý päťročný Jakubko sa pýta svojho sedemročného brata Petra:\r\n- A kam sa vráti bocian, keď nám prinesie sestričku?\r\n- To sú otázky! Predsa späť do otcových nohavíc!', 184, 3.03, 17),
	(2615, '"Mami, môžem nosit podprsenku, keď už mám pätnásť rokov?"\r\n"Nie, Miško!"', 81, 3.23, 17),
	(2616, '- Pani Nožičková, podáte mi ten šíp z vašej záhrady?\r\n- Pravdaže Vincko. A kde je?\r\n- Zapichnutý vo vašej sliepke!', 125, 2.94, 17),
	(2617, 'Malá Evka uvidí po prvý raz svätojánsku mušku a kričí:\r\n- Mami, mami,  pozri elektrická blcha.', 103, 3.22, 17),
	(2618, 'Malý chlapec sa postaví pri vodičovi autobusu a takto mu začne liezť na nervy:\r\n" Ujo a nie ste vy náhodov Číňan?!"\r\nVodič busu odpovedá:\r\n"Chlapče, prosím ťa, choď si sadnúť, náhodou silnejšie zabrzdím a niečo sa ti stane!"\r\nAle chlapec sa neda:\r\n"Ujo a nie ste vy náhodou Číňan?!"\r\n"Chlapče, ale vypadni odtiaľto rýchlo preč!"\r\n"Ujo a nie ste vy náhodou Číňan?!"\r\nVodič to už nevydrží a odpovedá:\r\n"No tak som a čo!"\r\n" A prečo nemáte šikmé oči?!"', 493, 3.75, 17),
	(2619, 'Ide dievča po ulici so psom a jedna babka jej hovorí:\r\n- Dievčatko, daj toho psa nabok, som samá blcha.\r\nDievčatko si odtiahne psíka a hovorí:\r\n- Poď, Harynko, lebo ešte dostaneš od paničky blchy!', 207, 3, 17),
	(2620, '- Synček môj, ja by som chcel od teba na Vianoce to, aby si ma poslúchal.\r\n- Sorry ocko, ale ja som ti už kúpil ponožky.', 126, 3.26, 17),
	(2621, '- Janko, ako si mohol toľko povystrájať v priebehu dňa?\r\n- Lebo dnes som skoro vstal.', 89, 2.98, 17),
	(2622, '- Jožko, kde si si tak zašpinil ruky?\r\n- Hral som sa  pieskovisku.\r\n- A prečo máš dva prsty čisté?\r\n- Lebo som potom pískal na psa.', 139, 2.95, 17),
	(2623, '- Mama, volala si ma? \r\n- Nie.\r\n- Oco, ty si ma volal?  \r\n- Nie.\r\n- Dobre, tak to sformulujem ináč. To dnes nebudeme vôbec nič žrať?', 138, 3.12, 17),
	(2624, '- Mamička, dnes sa nemusím kúpať - hovorí Miško.\r\n- A prečo? - pýta sa mamička.\r\n- Lebo sa mi snívalo, že som spadol do jazera.', 138, 2.82, 17),
	(2625, 'Malý Janko sa pýta mamičky:\r\n- Je to pravda, že som sa narodil o polnoci?\r\n- Áno, miláčik.\r\n- Dúfam, že som ťa nezobudil!', 131, 3.03, 17),
	(2626, 'Ujo sa pýta aničky:\r\n"Bojíš sa búrky?"\r\n"Prečo?"\r\n"Lebo ho mám veľký ako hrom."', 88, 3.13, 17),
	(2627, 'Príde Janko domov z katolíckej školy s monoklom pod okom a otec mu vraví:\r\n- Janko nevravel som ti, že sa nemáš biť s chlapcami?\r\n- Ale ja som sa vôbec nebil. To bolo takto: Boli sme v kostole, odriekali sme si modlitby a keď sme sa postavili, zbadal som, že sa našej učiteľke predo mnou zarezali šaty. Tak som jej ich vytiahol a ona mi dala facku.\r\nOtec na to hovorí:\r\n-Ale take veci ženám robiť nesmieš!\r\nNa druhý deň príde Janko domov s ďalším monoklom. Otec vraví:\r\n- Nevravel som ti včera dosť jasne?\r\nJanko na to:\r\n- Ale teraz to bolo úlne inak. Zase sme sedeli v kostole, odriekali sme si modlitby a keď sme sa postavili, učiteľke sa opäť zarezali šaty. Kamarát vedľa mňa jej ich vytiahol, ale ja som vedel, že to nemá rada, tak som jej ich zastrčil naspäť.', 808, 3.51, 17),
	(2628, 'Učiteľka sa v škole pýta Janka:\r\n- Janko, máš dve jabĺčka a ak jedno zješ, čo ti ostane?\r\n- Ohryzok, odpovedá Janko.', 127, 3.3, 17),
	(2629, '"Móricko, umy si krk, dnes k nám príde teta Marta!"\r\n"A čo keď nepríde? To mám ako blbec chodiť s umytým krkom?"', 121, 3.28, 17),
	(2630, 'Lampasácky synáčik večer otravuje: \r\n"Ocko, chcem vidieť bežkať sloníky"\r\n"Už je večer, sloníky sú unavené, musia spinkať." \r\n"Ocko, chcem vidieť bežkať sloníky." \r\n"Neotravuj! Sloníky už spinkajú."\r\n"Ocko, sloníky." \r\n"Už mám toho dosť! ROTA, CHEMICKÝ POPLACH !!!!!!!!"', 296, 3.42, 17),
	(2631, 'Pri rozvode sa pýtajú dieťaťa:\r\n"U ktorého z rodičov by si chcel zostať?"\r\n"Podľa toho, komu prisúdite počítač."', 124, 3.72, 17),
	(2632, '- Jožko, čo si kúpil babičke pod stromček?\r\n- Futbalovú loptu.\r\n- Futbalovú loptu? Veď babička nehrá futbal.\r\n- Práve preto. Ona mi kúpila knižky.', 159, 3.4, 17),
	(2633, '- Aké máte doma zvieratká, Ferko?\r\n- Mačku, psa a mrazené kura.', 68, 3.23, 17),
	(2634, 'Dve detičky sa hrajú na piesku.\r\nZrazu sa jedno pýta:\r\n- Ty si chlapček?\r\n- Nie, ja kakám.', 95, 3.39, 17),
	(2635, '- Dedo, pomóóc! - volá na ratu desaťročný vnuk.\r\n- Starkej sa pošmykol rebrík a spadla do hnojovky!\r\n- A to musíš tak vrieskať? Nevieš dať rebrík na miesto aj sám?', 178, 3.09, 17),
	(2636, 'Malý Jožinko sa díva večer na oblohu a pýta sa ocka:\r\n- Oci! Čo myslíš, je na tej hviezde život?\r\n- Čo sa tak hlúpo pýtaš, čo nevidíš, že sa tam svieti?', 169, 3.07, 17),
	(2637, 'Mamička vraví dcérke:\r\n- Pekne sa pozdrav, toto je teta Milka.\r\n- Čau kravička a navaľ čokoládu.', 104, 2.98, 17),
	(2638, 'Sedia deti na nočníku. Jedno hovorí.\r\n- Kam pôjdeme?\r\nDruhé hovorí.\r\n- Do lesa pôjdeme\r\nA tretie na to.\r\n- Do zadku pôjdeme, keď chodiť nevieme.', 154, 3, 17),
	(2639, 'Dcéra príde za mamou.\r\n- Mami, pamätáš, ako si mi povedala, že keď sa niekto narodí, tak sa narodí z prachu a keď zomrie, tak sa na prach obráti? Tak potom niekto akurát prichádza alebo odchádza pod mojou posteľou.', 229, 2.86, 17),
	(2640, 'Príde Jožko do školy a učiteľka sa ho pýta:\r\n- Teba ešte stále netrápia tie tvoje známky? \r\nA Jožko:\r\n- Tie nie, len to, prečo si ocko robí zbrojný preukaz. ', 171, 3.13, 17),
	(2641, 'V škole sa učiteľka pýta malého Peťka:\r\n- Peťko, chodí už tvoj malý braček?\r\n- Ešte nie, ale nohy už má.', 118, 3.26, 17),
	(2642, 'V lietadle...\r\nMalý Jožko sedí po prvý raz v lietadle. Je celý natešený, že od radosti v ňom pobehuje. Zrazu príde letuška s horúcou kávou a narazí do Jožka. Usmeje sa na neho a povie:\r\n- Chlapček, čo keby si sa išiel hrať vonku?', 248, 3.35, 17),
	(2643, 'Jede hrbatý pán v tramvaji a vypadne mu krabička cigaret značky Camel. Krabičku zvedne malá holčička a povídá:\r\n"Pane vypadla vám průkazka."', 152, 3.22, 17),
	(2644, 'Päťročný chlapček vystrája, matka mu dohovára:\r\n"Keď nebudeš dobrý, dám ťa ježibabe, uvidiš!"\r\n"Ale mamička, hádam by si ma už nechcela oženiť?"', 163, 2.88, 17),
	(2645, '"Keď som bol malý, otec ma často bil platňou, bil platňou, bil platňou."', 78, 3.11, 17),
	(2646, 'Zomrela starká,Jožko plače,lebo mu čítala každý večer rozprávku. Úlohy sa ujíma mamička,ale Jožko stále plače.\r\n"Prečo plačeš ?"\r\n"Starká ma aj hladkala." - vraví Jožko.\r\nMamička ho hladká a číta ďalej.\r\n"Starka mi drzala aj pipik." -vzlyká Jožko.\r\nMamička to urobí a pokračuje ďalej v čítaní.\r\nJožkov plač však neprestáva.\r\n"Lenže starkej sa aj triasla ruka."', 400, 2.97, 17),
	(2647, 'Mamička dá Jankovi 100 korún. Janko zabudol poďakovať. Mamička mu hovorí:\r\n- A čo si zabudol povedať?\r\nJanko stále nevie. Tak mu mamička trochu poradí:\r\n- Čo poviem ockovi, keď mi dá peniažky?\r\nJanko odpovedá:\r\n- Prečo mi dávaš tak málo?', 258, 2.95, 17),
	(2648, '- Mama, spadla nám skriňa.\r\n- Panebože, ocko o tom vie?\r\n- Jasnačka, veď je pod ňou.', 90, 3.01, 17),
	(2649, 'Matka uloží dievčatko späť. O chvíľu sa ozve: \r\n- Mami, ja musím ísť cikať. \r\nMamina ju dá vycikať. O chvíľu:\r\n- Mami, ja som smädná. \r\nMamina dá napiť. O chvíľu:\r\n- Mami, mne sa nechce spinkať. \r\nNa to mama vážne hovorí:\r\n- Janka, ak ešte raz budem počuť z tejto izby slovo mama, tak uvidíš.\r\nO chvíľu:\r\n- Pani Nováková...', 357, 3.23, 17),
	(2650, 'Jožko príde domov a chváli sa mame\r\n- Mami, vonku bil jeden chlapec druhého a tak som prišiel a pomohol mu. \r\nMama radostne:\r\n- A čo ti na to povedal, zlatko?\r\n- No nič, že by ho zbil aj sám.', 200, 3.16, 17),
	(2651, 'Chlapček si v obchode kúpi korytnačku ale za desať minút je späť, pretože vraj korytnačka má horúce bruško. Predavač si to overí a fakt.\r\n- No asi je chorá. Tu máš, zober si druhú.\r\nO desať minút je chlapček naspäť:\r\n- Aj táto má horúce bruško. \r\nPredavač už znervóznie, ale korytnačku znovu vymení. Potom sa rozhodne zistiť, čo je vo veci, vydá sa za chlapčekom a čo nevidí. Ten sedí na asfalte, korytnačku v ruke, jazdí s ňou po chodníku a kričí "brrm, brrrm".', 507, 3.02, 17),
	(2652, '- Mama, poď na dvor!\r\n- Ale prečo? \r\n- Lebo mi chalani neveria, že vyzeráš ako pokémon!', 93, 3.02, 17),
	(2653, '- Jožko, prečo si ockovi nakreslil zelené vlasy?\r\n- Lebo nemám plešatú farbičku.', 87, 3.28, 17),
	(2654, '- Mama, mama! Už viem, prečo je otecko taký tlsťoch!\r\n- Prečo?\r\n- Každý deň, keď odídeš do práce, príde k nám teta Klára a nafukuje ho cez cikáča.', 163, 3.43, 17),
	(2655, 'Dcéra má pred svadbou, tak ju matka zoznamuje s praktikami pohlavného života. Keď skončí, dcéra udivene hovorí:\r\n- To je všetko, mama? Tak potom už chápem, prečo ťa otecko tak často podvádzal!', 208, 3.04, 17),
	(2656, 'Príde chlapík na farmu a vidí, ako sa na dvore hrá malé dievčatko a pýta sa ho:\r\n- Ahoj maličká, kde máš otecka?\r\nDievčatko sa obzrie a odpovedá:\r\n- Kŕmi prasiatka v chlieve. Spoznáte ho hneď, má na hlave veľký klobúk!', 238, 3.19, 17),
	(2657, 'Spytuje sa otec svojho trinásťročného syna: \r\n- Preberáte už v škole sexuálnu výchovu? \r\n- Nie ocko, ale čo chceš vedieť?', 133, 3.11, 17),
	(2658, 'Príde Janko domov:\r\n"Mami, môžu mať deti deti?"\r\n"Nie, to je vylúčené"\r\nJanko odbehne na dvor:\r\n"Anička, nič z toho nebude!"', 133, 3.19, 17),
	(2659, 'Janko sa vychvaľuje pred kamarátmi:\r\n"Môj brat pracuje na takom pracovisku, že má pod sebou stovky ludí." \r\nKamarát:\r\n"Pracuje v továrni?" \r\nJanko: \r\n"Nie. Je strážcom na cintoríne."', 193, 3.2, 17),
	(2660, 'Miško príde domov a kričí mame:\r\n"Mami, ocko sa vracia z práce. Čo mu mám ukázať ako prvé? Vysvedčenie, zatykač, alebo zhorenú kuchyňu?"', 150, 3.46, 17),
	(2661, 'Jožko dá svojej mamičke cukrík. Po chvílke sa jej pýta: \r\n- Mami, chutil ti ten cukrík?\r\n- Áno Jožko.\r\n- No vidíš a náš Dunčo ho vupľul.', 151, 3.3, 17),
	(2662, '- Prečo neješ, Janko? Len pred chvíľou si hovoril, že si hladný ako vlk a teraz len sedíš a hľadíš do taniera.\r\n- No mamička a videla si ty už takého vlka, ktorý by jedol karfiol?', 194, 3.67, 17),
	(2663, 'Malý Jožko sa pýta svojho otca:\r\n- Ocko, ako sa rodia deti?\r\n- Prinesie ich bocian.\r\n- Aj mňa priniesol bocian?\r\n- Aj teba.\r\n- Aj Aničku priniesol bocian?\r\n- Aj ju.\r\n- Ocko, a bol si už u psychiatra?\r\n- Prečo?\r\n- Keď spíš s bocianom.', 243, 3.19, 17),
	(2664, '- Oci, kto vymyslel komunizmus? Vedci alebo filozofi?\r\n- Zrejme filozofi... Vedci by ho najskôr vyskúšali na zvieratách.', 124, 3.24, 17),
	(2665, 'Príde malý Ferko domov zo školy s plačom a hovorí:\r\n- Mami, mne sa stále smejú, že mám veľkú hlavu!\r\n- Ale nie Ferko nemáš. A prečo si si zaparkoval ten bicykel v obývačke?\r\n- To nie je bicykel, to sú okuliare!', 227, 3.21, 17),
	(2666, '- Oco, dnes ma učiteľ veľmi pochválil!\r\n- A za čo?\r\n- Že píšem ako lekár s dvadsaťročnou praxou!', 107, 2.64, 17),
	(2667, '- Mamička, prečo máš také veľké bruško?\r\n- Lebo tam mám babätko.\r\n- A prečo si ho zjedla?', 100, 3.01, 17),
	(2668, '- Mamička, keď si bola malá, bola si pánbožkova kravička? \r\n- Nie nebola. Prečo sa pýtaš dcérka?\r\n- Keď ti ocko hovorí "ty krava bohová".', 150, 3.25, 17),
	(2669, 'Trojročná Barborka hovorí tatkovi: \r\n- Tatko, naša mamka je učiteľka. A ty si aký?', 89, 2.92, 17),
	(2670, 'Na rohu ulice fajčí chlapec cigaretu. Ide okolo neho babička a pýta sa ho:\r\n- Chlapče, to tu vždy takto fajčíš?\r\n- Nie babi, len ak som opitý.', 152, 3.03, 17),
	(2671, '- Pani, váš syn mi strhol vlasový príčesok! \r\n- Chvalabohu, už som si myslela, že vás oskalpoval!', 105, 3.15, 17),
	(2672, 'Dvaja dvojroční chlapci sa rozprávajú:\r\n- Poťuj, včela som našiel na telase plezelvatív...\r\n- Hej, a ťo je to telasa?', 126, 3.38, 17),
	(2673, '- Mami, mami, zabil som päť múch! Dvoch samčekov a tri samičky...\r\n- Ako vieš, ktoré boli samičky a samčekovia?\r\n- Dve boli na poháre od piva a tri sedeli na zrkadle...', 178, 3.35, 17),
	(2674, '- Čo si robil cez prázdniny Jožko?\r\n- Bol som pri mori s maminkou a jej novým priateľom. \r\n- A čo, páčilo sa ti? Skamarátil si sa s "novým ujom"?\r\n- On je super kamoš! Každé ráno ma brával loďkou päť míl od pláže a ja som vždy potom plával k brehu. \r\n- A vládal si toľko plávať?\r\n- Plávanie bolo fajn, ale najhoršie bolo vymotať sa z vreca.', 370, 3.47, 17),
	(2675, 'Chlapček vstúpi do spálne vo chvíli, ked sa rodičia miluju.\r\n- Oco čo robíte?\r\n- Vieš, že ideme k moru na dovolenku, a pretože mama nevie plávať, napumpujem ju, aby sa neutopila. \r\n- Jéj, to je zaujimavé. Včera pumpoval mamu ujo poštár, a dokonca jej naslinil ventil.', 284, 3.23, 17),
	(2676, 'V Černobyle:\r\n- Jožko, už si si obul topánky?\r\n- Počkaj mami, ešte tri!', 77, 3.17, 17),
	(2677, 'Pýta sa mamička synčeka:\r\n- Ako sa ti páči nový otecko? \r\n- Mali sme aj lepších.', 88, 3.18, 17),
	(2678, 'Pýta sa chlapček tety:\r\n- Teta Elenka, prečo máš na rukách hnedý lak?\r\n- Aby som sa mohla šprtať v zadku.', 114, 2.65, 17),
	(2679, 'Na zastávke čaká tehotná žena. Vidí ju malý chlapec, ktorý sa pýta mamičky, prečo má také veľké brucho. Mama mu odpovie, že tá teta čaká babätko. Chlapček sa s pochopením obzerá po ostatných čakajúcich. V tom zbadá jedného veľmi tlstého pána. Príde k nemu a opýta sa:\r\n- Ujo, aj vy čakáte babätko?\r\n- Nie, ja čakám autobus.\r\nChlapec sa zamyslí a povie:\r\n- No to som si mohol myslieť.', 423, 3.2, 17),
	(2680, 'Chváli sa Móricko kamarátom:\r\n- Mňa priniesol bocian.\r\n- Ten ale musel mať svalovicu.', 90, 3.01, 17),
	(2681, 'Malý Jožko príde domov celý natešený.\r\n- Už viem, ako je to so vznikom bábätka. Medzi žlčníkom a pankreasom sa splašia hormóny a je to.\n', 150, 3.11, 17),
	(2682, 'Darinka rozpráva horor:\r\n"A keď tie obrovské pavúky poliala odvarom z trávy, stali sa z nich len obrovské hŕby humusu."', 126, 2.62, 17),
	(2683, '- Ocko, prečo sa musím učiť angličtinu?\r\n- Vieš, synček, po anglicky hovorí pol sveta.\r\n- A to nestačí?', 113, 3.09, 17),
	(2684, 'Malý Janko sa malej Aničke stále pozerá pod sukňu. Napokon jej vraví:\r\n- Anička, máš naopak nohavičky.\r\nA Anička na to:  \r\n- A čo mám čipku vzadu?\r\n- Nie, ale hnedý pásik vpredu.', 194, 3.18, 17),
	(2685, '- Mami a čo urobí bocian, keď donesie dieťa? \r\n- Nuž čo, obráti sa na druhú stranu a chrápe.', 101, 3.08, 17),
	(2686, 'V kupé vo vlaku:\r\n"Pani, prosím Vás, nech ma Váš synáčik nenapodobňuje!"\r\n"Nerob zo seba debila, Jožko!!!"              ', 129, 3.67, 17),
	(2687, 'Janko sa hrá v obývačke s vláčikom. Hovorí si:\r\n"Somári nastupovať, somári vystupovať."\r\nKeď ho počuje mamička, pošle ho do kuchyne. Po 2 hodinách jej ho však príde ľúto a dovolí mu ísť sa hrať znova. O chvíľu počuť z obývačky:\r\n"Somári vystupovať, somári nastupovať a skrz tú sliepku \r\nv kuchyni bude vlak meškať 2 hodiny."              ', 374, 3.25, 17),
	(2688, '- Tak čo dievčatko, čo by si chcela? \r\n- pýta sa predavačka\r\n- Chcela by som čokoládu, ale mama ma poslala kúpiť chleba.              ', 143, 3.43, 17),
	(2689, 'Pani učiteľka ukáže na obrázku zebru. Pýta sa detí, aké je to zvieratko. Nikto nevie a preto napovedá:\r\n- Z...\r\nNikto nevie.\r\n- Ze...\r\nStále sa nikto nehlási.\r\n- Zeb...\r\nPrihlási sa malý Móricko a hovorí:\r\n- Zeby to bol tiger?              ', 255, 3.92, 17),
	(2690, 'U holiča sedí na kresle malé dievčatko a spadne mu na zem žuvačka. Zodvihne ju a šup s ňou do úst.\r\n-A nemáš ju chlpatú? pýta sa holič.\r\nDievčatko sa naňho nevinne pozrie a vraví:\r\n-Nie, ja mám ešte len 6 rokov.              ', 244, 4, 17),
	(2691, 'Ocino, chcel by som pomôcť jednému starčekovi. \r\nDáš mi na to päť korún?\r\n-Pravdaže synak, to je od teba veľmi šľachetné. Tu máš dvacku. \r\nA kde je ten úbohý starček?\r\n-Tamto na rohu. Predáva zmrzlinu.              ', 235, 3.88, 17),
	(2692, 'Chlapec kričí spoza plota na pani v záhrade:\r\n-Pani, prosím vás, môžete mi priniesť môj šíp?\r\n-Ale áno, chlapče. odpovedá pani\r\n-a kde je?\r\n-Vaša mačka ho má zapichnutý v chrbáte.              ', 212, 3.63, 17),
	(2693, '-Vy ste zachránili môjho syna pred utopením?\r\n-Áno.\r\n-A kde má čiapku?              ', 90, 3.62, 17),
	(2694, 'Príde malá Anička za mamičkou a pýta sa jej:\r\n-Mamí, môžeme ísť s Jankom do garáže počúvať, ako ocko vymieňa koleso?\n', 133, 3.56, 17),
	(2695, 'Príde 8-ročný chlapček do baru a hovorí peknej barmanke:\r\n-Héj, zlato, čo takto škótska s ľadom?\r\nBarmanka:\r\n-Ufff. Chceš, aby som mala problém?\r\n-Možno neskôr, pipka. \r\n-Najprv by som si dal ten drink!              ', 230, 3.83, 17),
	(2696, 'Peťko sa pýta dedka:\r\n-Dedko, máš zuby?\r\n-Kdeže vnúčik, nemám.\r\nJanko okamžite na to:\r\n-Tak mi podrž môj chlebík.              ', 139, 3.62, 17),
	(2697, 'Ide dedko okolo pieskoviska a tam počuje malého chlapca, ako strašne škaredo nadáva. Príde k nemu a hovorí:\r\n-Počuj, veď ešte ti ani zuby nenarástli a už takto škaredo nadávaš!\r\n-A toto je ťo? \r\nUkáže malý na svoj jediný zub.\r\n-vali piťa?              ', 273, 3.87, 17),
	(2698, 'Malý chlapec píše Santa Clausovi:\r\n-Pošli mi bračeka!\r\nSanta Claus odpovedá:\r\n-Pošli mi mamičku!              ', 118, 3.92, 17),
	(2699, '-Oci, je atrament veľmi drahý?\r\n-Nie, prečo sa pýtaš?\r\n-Ale, mama strašne zúri, že som trošku vylial na gauč.              ', 133, 3.63, 17),
	(2700, '-Janko, prečo ideš tak neskoro do školy?\r\n-Mama porodila trojičky.\r\n-To je pekné. A ako sa volajú?\r\n-Ak som otcovi dobre rozumel, tak Himl, Herot a Krucifix.              ', 177, 3.95, 17),
	(2701, 'V lietadle v uličke medzi sedadlami sa stále hral asi trojročný chlapec. Letuška sa mu s úsmevom vyhýbala a ani raz ho neokríkla. Keď sa jej však chlapec priplietol do cesty vo chvíli, keď roznášala kávu, pozrela sa na neho prvýkrát trochu prísne a povedala:\r\n"Nemohol by si sa chvíľu hrať vonku?"\n', 319, 4.14, 17),
	(2702, '"Ocko, čo to máš také chlpaté medzi nohami?"\r\n"To nič Jurko, to je iba ježko."\r\n"Fíha, ten ježko má ale penis."              ', 135, 4, 17),
	(2703, '"Mamička, mne sa dnes snívalo o Aničke..."\r\n"To nevadí, ja to vyperiem!"              ', 90, 3.74, 17),
	(2704, 'Školáčik stojí pred tabuľou a rieši veľmi zložitú úlohu. Veľmi mu to nejde a stále si pľuje na ruku a sliny si vtiera do vlasov. Učiteľka je z toho nešťastná a pýta sa ho:\r\n"Prečo si, preboha, stále sliníš hlavu?"\r\n"Ale, včera som počul mamu, ako hovorí otcovi - Nasliň si hlavičku, uvidíš, že ti to pôjde ľahšie!"              ', 362, 3.5, 17),
	(2705, 'Jožko hovorí babičke:\r\n- Babička zatvor oči.\r\n- A prečo Jožko?\r\n- Ocko vravel, že ked´zavrieš oči budeme dediť.              ', 137, 4.25, 17),
	(2706, 'Pani učiteľka ďuro trápi ryby. Ale ako ich trápi? Postavý sa na most a spustí sopeľ nad vodu, a keď ho chce ryba chytiť potiahne ho naspäť.              ', 165, 3.64, 17),
	(2707, 'Na koncerte hovorí malý synček svojej mame:\r\n"Mami, keď tá pani prepíli svoj hudobný nástroj, pôjdeme domov?"              ', 132, 4, 17),
	(2708, '"Deti, ako robí ovečka?"\r\n"Béééé."\r\n"Dobre, a ako robí kohútik?"\r\n"Kikirikííí."\r\n"Dobre. A ako robí sviňa?"\r\n"Dobrý deň, cestná kontrola, vaše doklady, prosím."              ', 192, 4.27, 17),
	(2709, '"Oci, potreboval by som nový hard-disk."\r\n"A zázračné slovíčko?"\r\n"Kurňa! Všetko je dnes  zaheslované!"              ', 126, 3.73, 17),
	(2710, 'Na prechádzke si malé dievčatko zvedavo prezerá tehotnú pani.\r\n"Vy máte v brušku miminko?" pýta sa so záujmom.\r\n"Áno." odpovie pani.\r\n"A máte ho rada?"\r\n"Áno, veľmi."\r\n"Tak prečo ste ho zožrala?!"              ', 225, 3.73, 17),
	(2711, '"Mamička, až vyrastiem, dostanem takého muža ako je otecko?"\r\n"Samozrejme, dcérka."\r\n"A keď sa nevydám, bude zo mňa taká stará dievka, ako je teta Amálka?"\r\n"Áno, bude."\r\n"No to som teda v peknej kaši."              ', 229, 3.7, 17),
	(2712, 'Hádajú sa dvaja chlapci, kto má najmenšieho dedka. \r\nPrvý hovorí: "Môj dedo mi je iba po pás." \r\nDruhý hovorí: "Ten môj mi je len po kolená." \r\nA tretí na to: "Môj je v nemocnici!" \r\n"A prečo?" \r\n"Spadol z rebríka, keď oberal jahody."              ', 265, 4.14, 17),
	(2713, '- Mami, prečo má tato také velké bruško ako ty? Tiež čaká bábo? \r\n- ach ty môj malý výmyselník! Nie nie, on čaká takého malého sloníka. \r\n- áno, áno, videl som... už mu trčí chobot!              ', 218, 4.13, 17),
	(2714, 'Starý otec sa pýta vnuka:\r\n- Janko, ako ďaleko si s tou angličtinou?\r\n- No, zatiaľ viem povedať iba dobrý deň, ďakujem a prosím...\r\n- To je výborné! Veď doteraz si to nevedel ani po slovensky.\n', 206, 4, 17),
	(2715, '"Ferko, už máš 10 rokov, chcem ti porozprávať, ako sa robia decká... " hovorí Mišo synovi.\r\n"Len to nie, otec! V 5-tich rokoch som sa dozvedel, že Ježibaba neexistuje, v 6-tich, že Ježisko nenosí darčeky,  keď sa teraz dozviem, že dospelí nesúložia, čomu budem veriť?"              ', 303, 4.25, 17),
	(2716, 'Pred obchodom sú tri deti v kočíkoch. Prve vraví:\r\n- Plebalí ma maminka alebo ma neplebalí?\r\nDruhé:\r\n- Kúpi maminka ham ham alebo nekúpi ham ham?\r\nTretie:\r\n- To sú problémy. Sadla som si na valček a telaz neviem, som panna alebo už nie?              ', 263, 3.87, 17),
	(2717, 'Dievčatko tlačí prázdny kočiarik. Babka sa jej pýta:\r\n- A prečo nemáš v kočiariku bábiku?\r\n- Lebo beriem antikoncepciu.              ', 144, 3.86, 17),
	(2718, 'Anička a Janko sa hrajú v piesočku.Janko jej dá ruku pod sukničku a pýta sa:\r\n- Anička, ty si chlapček?\r\n- Nie, kakám.              ', 141, 3.69, 17),
	(2719, 'Mamička hreší synčeka:\r\n- Janko, vystri sa, aby si mal pekný rovný hrudníček!\r\nJanko na to odvetí:\r\n- Načo, však ani ty ho nemáš rovný!"              ', 164, 3.64, 17),
	(2720, ' Mami, ten pán je polievku vidličkou.\r\n- Pst, anjelik!\r\n- A teraz pije vodu z vázy na kvety.\r\n- Miláčik, buď ticho!\r\n- A teraz hryzie tácku na pivo.\r\n- Daj mi už konečne pokoj a vráť pánovi okuliare!              ', 225, 3.86, 17),
	(2721, '..."Mama, môžem vylízať túto misu?!..."\r\n"Nie synak, radšej spláchni!!!"              ', 93, 3.88, 17),
	(2722, 'Deti idú na prechádzku a prídu k rybníku a hneď sa idú kúpať. Pani učteľka si vraví:\r\n"No nemám síce plavky, ale deti z toho nemajú rozum, tak môžem ísť len tak."\r\nTak sa vyzlečie a Janko sa jej pýta:\r\n"Pani učiteľka, čo to máte medzi nohami?"\r\n"No vieš Janko, to mám z vojny..."\r\n"Ale nevravte! A rovno na piči?!"              ', 355, 4.19, 17),
	(2723, '„Oci, v škole som dostal pätku.“ „No super! Každá koruna dobrá.“               ', 92, 4.22, 17),
	(2724, 'Učiteľka sa pýta žiakov, ako si predstavujú Vianoce. Mišo sa prihlási a vraví: \r\n„Zahrmí, zablýska sa a v okne sa ukáže veľká biela rapavá riť, pretože otec mi povedal, že aj tak hovno dostanem“.              ', 231, 4.13, 17),
	(2725, 'Detičky majú v škole nemčinu \r\na majú hovoriť názvy kvetov. Anička: „Die Rose.“ \r\nUčiteľka: „Schőn, Anička, schőn. „ Janka: „Der Tulipan.“ \r\nUčiteľka: „Schőn, Janka, schőn.“ Móricko: „Der Orgasmus.“ Učiteľka: „Móricko, ale veď to nie je kvetina.“ \r\n„Ale je to schőn.“               ', 333, 3.56, 17),
	(2726, 'Hľadám ženu s troma deťmi. Značka: Nezamestnaný učiteľ.              ', 77, 3.85, 17),
	(2727, 'Príde chlapček k tabuli  a napíše 3 + 2 = 6!\r\nUčiteľka sa pýta: ,,Prečo si to napísal? "chlapček odpovedá: ,,To viete pani učiteľka, dnes je všetko drahšie"\n', 172, 3.83, 17),
	(2728, 'Dcéra doniesla zo školy poznámku: \r\n"Je papuľnatá, odvráva \r\na nedá si povedať!"\r\nNa druhy deň číta učiteľka \r\nv škole:\r\n"To má po matke, zmlátil som obe!"              ', 185, 4, 17),
	(2729, 'Mamička, pod mojou posteľou leží chlap. \r\n"Nič si z toho nerob, nechaj ho tak."\r\n"Aj by som ho nechala, ale keď on chce ešte raz!"              ', 151, 3.7, 17),
	(2730, 'Ruská matka, hrdinka socialistickej vlasti mala 10 synov a všetci sa volali Voloďa. Raz za ňou prišiel americký novinár a spýtal sa jej: \r\n„Ako rozlíšite jedného od druhého, veď keď zavoláte jedného, prídu všetci...“ \r\nMatka na to: „Volám ich menom po otcovi...“               ', 304, 4, 17),
	(2731, 'Chlapec sedí pri žumpe \r\na narieka: \r\n"Moja matka, moja matka."\r\nIde okolo policajt, neváha, skočí do žumpy. O chvíľu sa vynorí a hovorí:\r\n"Ľutujem, chlapče, tvoja matka tu nie je."\r\n"Tak to mi je nahovno aj šróbik."              ', 244, 4, 17),
	(2732, 'Na hodine fyziky:\r\n– Telesá sa teplom rozťahujú a zimou sťahujú,\r\n– vysvetľuje novú učebnú látku pán učiteľ.\r\n– Vedel by niekto uviesť príklad?\r\n– No, napríklad prázdniny sú v lete dlhšie a v zime kratši,\r\n– pohotovo odpovedá žiak.\n', 264, 3.83, 17),
	(2733, 'Prečo si včera bola v škole tak dlho?\r\nNadrabam. Zajtra si chcem vziať voľno!!!              ', 98, 4, 17),
	(2734, '"Mami,môžem sa dívať na telku?!"\r\n"Áno,ale nezapínaj ju!!!"              ', 79, 3.11, 17),
	(2735, '- Kubko stoj rovno urobím ti na hlave cestičku.\r\n- mami urob mi aj autíčko.              ', 93, 3.44, 17),
	(2736, 'Zuzka, prečo ma ten šalát takú čudnú chuť? Neviem mami, veď som ho aj mydlom umyla.              ', 105, 3.8, 17),
	(2737, '- Mami, môžem isť kúpiť chleba? \n- Nie dcéra v takom počasí by som ani psa von neposlala.\n- Ale čo budeme jest? \n- Pošlem do obchodu otca.              ', 162, 3.94, 17),
	(2738, 'Peťko príde do lekárne a pýta sa:\n-Prezervatívy máte?\n-Po prvé, hovorí nahnevaná magistra, prezervatívy nie sú pre deti a po druhé, povedz otcovi, nech príde sám a vyberie si podľa  rozmeru.\n- Po prvé, odvetí Peťko, prezervatívy nie sú pre deti, ale proti deťom, a po druhé, nebudem otcovi nič hovoriť, do kúpeľov ide mama a ešte nevie, aký bude rozmer...\n', 384, 4.2, 17),
	(2739, 'Jožko podáva ockovi papier a povie: "Ocko nespravíš mi lietadielko?"\r\nOcko mu ho spraví a Jožko ho vyhodí von oknom. Zrazu sa ho otec pýta: "Ozaj, Jožko a kde máš vysvedčenie?"\r\nA Jožko odpovie: "Práve vyletelo von oknom."              ', 250, 3.7, 17),
	(2740, 'Janka ide s mamou do prvého obchodu a Janka sa pýta mamy: \r\nMami môžem spraviť mlynské kolo?\r\nMama: Nie, lebo by ti chlapci videli gaťky! Idú do druhého obchodu a Janka sa pýta: Mami môžem spraviť mlynské kolo?\r\nMama: Nie, lebo by ti chlapci videli gaťky! Idú do tretieho obchodu a Janka sa pýta mami: Mami môžem spraviť mlynské kolo?\r\nMama: Áno, ale tak aby ti chlapci nevideli gaťky.\r\nMama víde z obchodu a pýta sa Janky:\r\nTak čo, videli ti chlapci gaťky?\r\nJanka: Nie, lebo som si ich dala dole!              ', 538, 3.78, 17),
	(2741, 'Ide pani po sídlisku a vidí asi desaťročného chlapca fajčiť, tak sa ho pýta:\r\n”Ako to, že už fajčíš?”\r\nChlapec na to: \r\n”Keď som sa včera miloval, tak prečo by som nefajčil?”\r\nPani je z toho celá zmätená, tak sa ešte opýta:\r\n”A mal si z toho vôbec niečo?”\r\n”Nemal, bol som ožratý ako prasa!”               ', 348, 4, 17),
	(2742, '"Mamička, môžem sa večer dívať na Troch mušketierov?"\r\n"Nie, Zuzka, na Troch mušketierov si ešte malá."\r\n"Tak ja sa budem dívať aspoň na jedného, dobre?"              ', 181, 3.25, 17),
	(2743, 'Pani učiteľka sa pýta Miška: \r\n-"Miško povedz mi kde je najviac pismen r?" \r\n-A Miško na to: pŕŕŕŕŕŕŕŕŕŕŕŕd.              ', 140, 3.75, 17),
	(2744, '"Fero, syn ti už narástol?"\r\n"Narástol!"\r\n"A pomáha ti?"\r\n"No! Včera mi pomohol prepiť výplatu."              ', 117, 4.18, 17),
	(2745, 'Malý chlapec sa márne snaží dočiahnuť na zvonček. Ide okolo starší pán, a tak mu pomôže. Keď zazvoní, chlapec naňho zavolá:\r\n"Fajn dedo, teraz zdrháme!"              ', 183, 4.22, 17),
	(2746, 'Miško chce na Vianoce moped.\r\nPíše Ježiškovi: Ježiško, budem minútu dobrý, ak mi pošleš moped. Potom sa zamyslí, roztrhá papier a rozmýšľa: ale ja ani sekundu neviem byť dobrý! Zrazu uvidí na stene Pannu Máriu. Schytí ju a hodí ju do skrine. Píše ďalší list Ježiškovi: Ježiško! Zajal som tvoju matku! Výkupné je moped!!!              ', 367, 3.75, 17),
	(2747, '”Oci, je červené more naozaj červené?”\r\n”Janko, to nemáš ľahšiu otázku?”\r\n”Tak dobre. Kedy zomrelo Mŕtve more?”              ', 147, 3.92, 17),
	(2748, 'Malý Tiborko hovorí mamičke:\r\n”Ak je ujo Peter naozaj tvoj brat, prečo sa nikdy nepobijete?”              ', 114, 3.7, 17),
	(2749, '”Počul som, že vaša dcéra sa chce stať rockovou speváčkou.\r\nA má nejaké úspechy?”\r\n”Zatiaľ obrovské, kúpil som lacno dva susedné domy!”              ', 171, 4.2, 17),
	(2750, '”Mami, vieš koľko náplne je v zubnej paste?”\r\n”Nie, neviem.”\r\n”Vidíš, ja to viem. Od sedačky až po televízor.”              ', 144, 4.21, 17),
	(2751, 'Otec príde za synom a vraví mu:\r\n”Synak, vieš, že tvoj otec je génius?”\r\nSyn sa na neho zahľadí a vraví:\r\n”Takže ty predsa nie si môj otec?”              ', 172, 4.06, 17),
	(2752, 'Matka vezie syna do školy. Keď Janko vystupuje, nezabudne sa spýtať:\r\n”A ako to, mami, že dnes sme nestretli žiadnych idiotov, amatérov, blbcov, hovädá, sráčov a imbecilov?”\r\n”To bude tým, že dnes ťa neviezol tvoj otec!”              ', 256, 4, 17),
	(2753, 'Dcéra sa zveruje matke:\r\n”Aj by som za toho Jana išla, ale zdá sa mi, že je alkoholik.”\r\n”Prečo?” vyzvedá matka.\r\n”Dnes som mu sedela na kolenách a zdalo sa mi akoby mal vo vrecku pollitrovku.”\r\n”Ach, ty hlúpa, hneď ho ber! Ja som celý život sedela na ampulke od liekov!”              ', 312, 3.75, 17),
	(2754, 'Mama hovorí svojmu synovi:\r\n”Dúfam, že si si na Mikuláša prial kladivo!”\r\n”Prečo mami?”\r\n”Aby si si vytĺkol Ježiška z hlavy.”              ', 160, 3, 17),
	(2755, 'Pýta sa matka dcéry:\r\n”Tak čo, vyjadril sa už ten tvoj nápadník?”\r\n”Áno ... musím počkať.” informuje ju dcéra.\r\n”A dokedy máš čakať?”\r\n”To neviem. Povedal, že som posledná, ktorú by si vzal.”              ', 239, 4, 17),
	(2756, 'Policajt napomína svojho syna:\r\n”Nefajči Jožko, si na to primladý!”\r\n”Ale oci, aj ty si bol piatak, keď si začal fajčiť!”\r\n”To áno, synak, ale vtedy som mal už šestnásť rokov!”              ', 215, 3.91, 17),
	(2757, 'Janko príde domov a mama sa ho pýta:\r\n”Ako bolo prvý deň v škole?”\r\n”Je to podvod. Na dverách je napísané 1. trieda a vnútri samé drevené lavice.”              ', 179, 3.77, 17),
	(2758, '”Deti, ako hovorí ovečka?”\r\n”Bééé!”\r\n”Dobre. A ako hovorí kohút?”\r\n”Kikirikí!”\r\n”Dobre. A ako hovorí sviňa?”\r\n”Dobrý deň, cestná kontrola, vaše doklady prosím!”              ', 213, 3.86, 17),
	(2759, 'Malý syn sa pýta:\r\n”Otecko, má had chvost?”\r\n”Hmm, iba chvost.”\n', 75, 3.93, 17),
	(2760, '”Miško, vieš povedať dve zvieratá na x?”\r\n”Xes a xrana.”              ', 82, 2.78, 17),
	(2761, 'Mama karhá syna:\r\n”Hovorila som ti, že tie sánky budeš požičiavať aj bratovi!”\r\n”Veď mu ich požičiavam! Ja ich mám z kopca a on do kopca.”              ', 171, 3.33, 17),
	(2762, '”Pani učiteľka, má srdiečko nohy?” pýta sa Dežko.\r\n”Nemá, ako si na to prišiel?” čuduje sa učiteľka.\r\n”Včera som išiel okolo senníka a počul som: Srdiečko, roztiahni nožičky.”              ', 219, 4.11, 17),
	(2763, 'Jožko dostal nový bicykel. Predvádza sa na ňom otcovi, ktorý sa naňho pozerá z okna. Jožko kričí:\r\n”Aha ocko, bez rúk!”\r\nPo chvíli:\r\n”Aha ocko, bez nôh!”\r\nA potom:\r\n”Aha ocko, bež žubov!”              ', 228, 3.92, 17),
	(2764, 'Matka vojde do detskej izby, aby skontrolovala, čo robí jej dcérka. Vidí, že si zo stavebnice stavia domčeky, a tak pokojne odíde do kuchyne. O chvíľu nakukne do izby znova a vidí, že dcérka drží krhlu a leje na domčeky vodu:\r\n”Preboha, čo robíš?!” pýta sa.\r\n”Povodeň.” odpovie dievčatko.              ', 331, 3.89, 17),
	(2765, 'Dcéra sa pýta:\r\n”Mami, keď vyrastiem, dostanem takého muža, ako je otecko?”\r\n”Určite, zlatko.”\r\n”A keď sa nevydám, bude zo mňa taká stará dievka, ako teta Betka?”\r\n”Možno aj horšia.”\r\n”No, to som v peknej kaši.”  \n', 248, 3.29, 17),
	(2766, 'Narieka mafiánska matka nad svojím synom:\r\n”Čo len z teba bude? Otec je postrachom celého podsvetia, ja som bola desať rokov vo väzení a ty prinesieš zo školy jednotku zo správania!!!”              ', 212, 3.71, 17),
	(2767, '”Janko, kde máš brata?”\r\n”V nemocnici.”\r\n”A čo sa mu stalo?”\r\n”Súťažili sme, kto sa vykloní viac z okna a on vyhral.”\n', 141, 3.29, 17),
	(2768, 'Janko sa pýta mamy:\r\n”Je to pravda, že som sa narodil\r\no polnoci?”\r\n”Áno, miláčik.”\r\n”Dúfam, že som ťa nezobudil” ustarostene vraví syn.               ', 172, 3.5, 17),
	(2769, 'Matka kričí na svoju desaťročnú dcéru:\r\n”Fajčila si moje cigarety?”\r\n”Áno, ale iba dve.”\r\n”Tak za trest pôjdeš dnes spať bez koňaku.”               ', 172, 3.75, 17),
	(2770, 'Janko sa na Vianoce pýta otca:\r\n”Oco, vieš, ktorý vlak najviac mešká?”\r\n”Neviem, ktorý?”\r\n”No predsa ten, čo si mi sľúbil minulé Vianoce.”              ', 174, 4.2, 17),
	(2771, 'Pred jedným americkým supermarketom vyliezlo dieťa Santa Clausovi na kolená a on sa ho, ako všetkých detí, opýtal:\r\n”Tak, čo by si chcel na Vianoce, maličký?”\r\nDieťa vyvalilo oči a opýtalo sa:\r\n”Čože?! Ty si nečítal môj e-mail?!?”              ', 271, 3.9, 17),
	(2772, 'Zveruje sa matka dcére so svojimi obavami:\r\n”Nerada vidím tie tvoje výlety s Robom na motorke. Môže ťa zaviesť niekam do lesa, tam bude od teba chcieť ktoviečo a keď mu nevyhovieš, nechá ťa ísť domov pešo...”\r\n”Ale mami, prišla som snáď už niekedy domov pešo?”              ', 303, 3.88, 17),
	(2773, 'Matka kričí na syna:\r\n”Jožko, už som ti vravela, že sa nemáš hrať so zápalkami!”\r\n”Mami, ja som sa nehral, ja som si chcel zapáliť cigaretu.”              ', 174, 4.1, 17),
	(2774, 'Pani učiteľka príde domov k Miškovým rodičom a vraví jeho otcovi:\r\n”Váš syn nebol včera v škole.”\r\n”Áno, nebol.”\r\n”Ani dnes nebol!”\r\n”Nebol ani dnes, ani zajtra nebude!”\r\n”A prečo?”\r\n”Zabil som ho, smrada!”              ', 257, 4.21, 17),
	(2775, 'Janko sa hrá v obývačke s vláčikom. Hovorí si:\r\n”Somári nastupovať, somári vystupovať.”\r\nKeď ho počuje mamička, pošle ho do kuchyne. Po dvoch hodinách jej ho však príde ľúto a dovolí mu ísť sa hrať znova. O chvíľu počuť z obývačky:\r\n”Somári vystupovať, somári nastupovať a skrz tú sliepku v kuchyni bude vlak meškať dve hodiny.”              ', 386, 3.92, 17),
	(2776, 'Janko ide opäť spať s mokrou hlavou a otecko ho napomína:\r\n”Janíčko, veď nemusíš dávať každý večer pusu na dobrú noc našej zlatej rybke!”              ', 171, 2.19, 17),
	(2777, 'Syn pribehne za otcom a kričí:\r\n”Oco, vyskúšal som tvoju novú motorku...”\r\n”A čo?”\r\n”Mám ti to porozprávať, alebo si to zajtra prečítaš v novinách?”              ', 187, 3.63, 17),
	(2778, '-Spadol mi z okna chlebík!\r\n-A s čím si ho mal s masielkom?\r\n-S ockom!!!\r\n-A kam spadol?\r\n-Dole, susedke na balkón.\r\n-Tak to sa riadne vyľakala?\r\n-Ty, ani nie, len povedala, že dneska nie, lebo je starý doma.              ', 229, 3.86, 17),
	(2779, 'Deti sa schovali pod posteľ. O chvíľu sa z kina vrátili rodičia a žena hovorí mužovi:\r\n”Mmm... deti tu nie sú... asi už spia, tak poďme na vec, kým sme sami!”\r\nPod posteľou hovorí Peťko sestre:\r\n”Vidíš ich, hajzlov! Nás dvoch tu lisujú a robia si nového!”              ', 297, 3.86, 17),
	(2780, 'Syn kričí:\r\n”Mami, mami, zabil som päť múch! Dvoch samčekov a tri samičky.”\r\n”Ako vieš, ktoré boli samičky a ktorí samčekovia?”\r\n”Dve muchy boli na pohári od piva a tri sedeli na zrkadle...”              ', 229, 3.55, 17),
	(2781, '”Chcel by som mať plat 30000 korún ako môj otec.\r\n”Čo? Tvoj otec zarába 30000 korún?!”\r\n”Nie, ale tiež by chcel.”              ', 144, 3.95, 17),
	(2782, 'Keď som bol malý, otec ma často bil platňou, bil platňou, bil platňou...              ', 92, 4.11, 17),
	(2783, 'Mariena išla na zábavu a ostražitá matka s ňou poslala aj mladšieho brata, aby na ňu dával pozor. O polnoci sa brat vráti sám a matka okamžite vyzvedá, kde je Mariena. Brat hovorí:\r\n- Oni si s Janom v lese dávajú dole nohavice. Mne sa čúrať nechcelo, tak som išiel domov.              ', 304, 3.29, 17),
	(2784, '-Ale deti, co su to za sposoby, aby sa v skole bili spoluziaci.\r\nMy nie sme spoluziaci, my sme surodenci.              ', 119, 3.8, 17),
	(2785, 'Detko opravuje strechu a volá na vnučku, ktorá stojí vo dvore\r\n-Anička choď ďalej lebo spadnem rovno na teba!\r\nAnička odišla kúsok ďalej a hovorí:\r\n-Detko, už som preč môžes padnúť!              ', 213, 4.18, 17),
	(2786, 'Malý chlapec je prvýkrát v ZOO. Pri vchode sa pýta:\r\n- Mami, to je opica?\r\n- Nie, synček, to je zatiaľ len pokladníčka.              ', 141, 3.5, 17),
	(2787, 'Otec je sám doma so synčekom:\r\n- Peťko, čo robíš?\r\n- Papám sekundové lepidielko.\r\n- Čo?!\r\n- Hmmm hmm hmm...              ', 130, 3.63, 17),
	(2788, 'Filip dostane guľu v škole a otec sa ho rozhodne zbiť. Filip zatína zuby a po bitke otcovi ironicky povie:\r\n- Ha! A teraz Ti slávnostne prisahám, že sa Ti pomstím na Tvojich vnúčatách!!!              ', 211, 3.86, 17),
	(2789, 'Malý Maťko donesie domov veľmi zlú známku zo zemepisu a otec na neho reve:\r\n- Ty hlupák, ako si mohol dostať takú zlú známku? Čo si vlastne, ty "chytrák" nevedel, há?\r\n- Kde leží Afrika.\r\nDo rozhovoru sa zapletie aj mama:\r\n- A ty, muž môj, vieš kde leží Afrika?\r\n- Aby si vedela, tak náhodou viem, že to je určite niekde blízko, lebo ku nám do práce chodí jeden černoch na bicykli!!!              ', 425, 4.29, 17),
	(2790, 'Jožko dostal na Vianoce psíka, ale na Nový Rok psíka prešlo auto. Jožko priniesol mŕtveho psíka do školy a vraví:\r\n"To je môj psík, dostal som ho na Vianoce. \r\nAuto mu ale nabúralo do riti."\r\nUčiteľka ho zahriakne:\r\n"Riť je škaredé slovo, mal by si vravieť zadnica."\r\nJožko odpovie:\r\n"Do zadnice mu to zasrané auto vrazilo."\n', 346, 2.71, 17),
	(2791, 'Niekto zvoní pánkovi pri dverách na piatom poschodí. Ide otvoriť a vidí postihnutého chlapca.\r\n- Nadácia Dúha, pomôžte mentálne retardovaným deťom, za 10 korún umývame okná.\r\n- Ale ja mám okná umyté.\r\n- Ale ujo, nadácia Dúha, pomôžte retardovaným deťom...\r\nNo dobre. Pustí ho dnu. O 10 minút znova niekto zvoní pri dverách:\r\n- Nadácia Dúha, za 10 korún umývame okná, pomôžte retardovaným deťom....\r\n- Ale ja tu už takého jedného od vás mám.\r\n- To som ja, ja som vypadol.....              ', 532, 3.96, 17),
	(2792, 'Rozpravájú sa dve malé dievčatká:\r\n- Ako zistíš, že sa ti nejaký chlapček páči veľmi alebo nie?  Druhá vravi:\r\n- Ja si vyhodím korunku... Keď padne hlava, páči sa mi. Keď padne\r\nznak, páči sa mi veľmi. A ty?\r\n- Ja si vyhodím nohavičky... Keď padnú, tak sa mi páči. Ak zostanú\r\nprilepené na plafóne, pači sa mi veľmi.\n', 350, 3.67, 17),
	(2793, 'Janko: “Ja mám pipíka a ty nemáš!\r\nMarienka: “Ja keď budem veľká, budem ich mať koľko chcem a ty stále iba jedného!              ', 144, 4.1, 17),
	(2794, 'Z malého Janka je iba hlava. Sú Vianoce a Janko sa kotúľa smerom k vianočnému stromčeku. Chytí do úst svoj darček a zubami ho otvorí. Zbadá obsah a zarmútene hovorí:\r\n”Do čerta, zase čiapka.”               ', 226, 3.9, 17),
	(2795, 'Ide Janíčko, Marienka a babička spolu na prechádzku a Marienka sa pýta:\r\n- Babka, môžem sa ísť vycikať?\r\n- Jásné, choď tam, za kríčky.\r\nMarienka odíde a Janíčko sa babky pýta:\r\n- Babka, čo má Marienka medzi nôžkami?\r\n- Pokladničku zlatko, pokladničku\r\nPo chvíli Janíčk vraví:\r\n- Babka môžem ísť na záchod?\r\n-Pravdaže len bež!\r\nMarienka sa zatiaľ pýta:\r\n-Babka, čo má Janíček medzi nôžkami?\r\n-Peniažtek zlatko, peniažtek. \r\nPrídu domov a z Marienkinej izby je počuť ochkanie a...:\r\n-Daj tú nohu preč, nemôžem dať peniažtek do pokladničky!              ', 607, 2.89, 17),
	(2796, '- Ocíí, treba mi ísť cikať.\r\n- Ale, synu, takí veľkí chlapci ako ty, tak nehovoria! Nabudúce povieš, že chceš pískať.\r\nV noci sa syn zobudí, drgne do mamy a hovori:\r\n- Mami, chcem pískať!\r\nRozospatá mama nechápe a odpovedá:\r\n- Teraz v noci? Zobudíš susedov!\r\n- Ale ja chcem veľmi pískať!\r\n- No tak dobre. Zapískaj mi do uška, ale len tak potichúčky.               ', 393, 3.77, 17),
	(2797, '- Dedo, chceš zmrzlinu?\r\n- Nie.\r\n- A teraz sa na to spýtaj ty mňa!              ', 83, 4.13, 17),
	(2798, '- Mama, lampa horí! \r\n- Nehovorí sa horí, ale svieti...\r\n- Tak mama, aj záclony svietia!               ', 107, 4.03, 17),
	(2799, '- Tak Ferko, aké bolo vysvedčenie? \r\n- Mami, to je predsa jedno, hlavne že sme zdraví!                 ', 107, 4.08, 17),
	(2800, '- Jožko, čo si kúpil babičke pod  stromček?\r\n- Futbalovú loptu.\r\n- Futbalovú loptu? Veď babička nehrá futbal.\r\n- Práve preto. Ona mi kúpila knižky.\n', 161, 3.86, 17),
	(2801, 'Janko sa pýtal otecka, že ako prišiel na svet. \r\n- Vieš Janíčko, my sme sa s mamičkou tak večer trochu pocukrovali, a ráno si sa narodil, odpovedá otec. Janko sa večer posypal cukrom, a ráno keď sa zobudil, posteľ mal plnú mravcov. Janko hovorí: \r\n- Keby som nebol vašim otcom, tak vás všetkých  pozabíjam.              ', 341, 3.43, 17),
	(2802, 'Vo vlaku.\r\n-Prosím Vás pani, povedzte svojmu synovi, aby ma nenapodňoboval.\r\n- Martin, prestaň zo seba robiť debila! \n', 123, 2.88, 17),
	(2803, 'Jožko vraví mamičke: „Mamička, deti v škole sa mi smejú, že mám veľké zuby. Je to pravda?" „To vieš, že nie. Deti preháňajú. Ale už zavri ústočká, aby si nám nepoškriabal parkety."              ', 219, 3.6, 17),
	(2804, 'Malý Peťko si stále strká prst do nosa a nie si to odvyknúť. Mamička si preto vymyslí malú lož: „Keď si neprestaneš strkať prst do nosa, budeš tučný ako strýc Jožo." To Peťka zaujme. Popoludní v električke pristúpi pani vo vysokom štádiu tehotenstva.  Peťko si ju pozorne prezrie a začne na ňu žmurkať. Pani je udivená: „Chlapček, ty ma poznáš?" „Nie," hovorí Peťko spiklenecky. „Ale viem, čo ste robila..."\n', 452, 4, 17),
	(2805, 'Príde matka s dcérou k lekárovi: \r\n"Pán doktor, nepozrel by ste sa na dcérku, prečo \r\nmá tak vypleštené oči?" \r\nDoktor si ju prehliadne a povie: \r\n"Povoľte jej vo vlasoch gumičku."              ', 206, 4, 17),
	(2806, 'Tatko sleduje syna, ako ide večer niekam s baterkou. Pýta sa: \r\n"Kam ideš s tou baterkou?" \r\n"Na rande." \r\n"Cha-cha, keď som ja chodil na rande, nikdy som si nebral baterku." \r\n"No a pozri sa, čo si zbalil!"              ', 226, 4.22, 17),
	(2807, 'Predstavujú sa dvaja chlapci: \r\n"Ja som Petrík. Ale bez X." \r\n"Veď tam žiadne X nie je." \r\n"Veď vravím, že bez X!"              ', 135, 4.25, 17),
	(2808, 'Rodičia sa  večer ponáhľajú do divadla, a tak pustia svojmu synčekovi gramofón, aby po dopočúvaní platne išlo spať. Vrátia sa o dve a pol hodiny, dieťa bije hlavou o stenu a kričí: \r\n"Chcem! Chcem! Chcem!" a z gramofónu sa ozýva: \r\n"Chcete počuť rozprávku? Chcete počuť rozprávku? Chcete počuť rozprávku? ..."              ', 350, 4.09, 17),
	(2809, 'Ráno sa prebudí chlapček a vedľa neho je zajačik Azurit. \r\n"Jéj, čo tu robíš?" \r\n"Kradnem ti džínsy." \r\n"A budeš tu, keď sa vrátim?" \r\n"Si asi blbý, že?!"              ', 184, 3.83, 17),
	(2810, 'Už týždne je štadión vypredaný a krátko pred zahájením finálového zápasu poháru si sadne na čestné miesto malý chlapec.  \r\n- Kde si prišiel k tej čestnej vstupenke? - pýta sa usporiadateľ.\r\n- Doma, som starostov syn.\r\n- A kde je pán otec?\r\n- Doma, neúspešne hľadá tú čestnú vstupenku.              ', 326, 3.6, 17),
	(2811, 'Babička príde na návštevu a pýta sa vnučky: \r\n- Tak čo, malá, ako sa ti páči tvoj nový malý braček?\r\n- Ale hej, je celkom fajn, pokrčí dievčatko ramenami. Ale je mnoho vecí, ktoré by sme potrebovali viac.              ', 236, 3.64, 17),
	(2812, 'K učiteľovi huslí v Chicagu sa dostaví malý Tom. \r\nOtvorí púzdro a namiesto huslí je v ňom samopal. \r\n"No, nazdar!" zdesí sa. "Tak, to som naozaj zvedavý, čo bude ocko robiť v banke s husľami!"              ', 221, 4.25, 17),
	(2813, 'Príde maličký chlapček do lekárne a pýta sa: \r\n"Teta, ty tu predávaš rybí tuk?"\r\n"Áno."\r\n"Ty sviňa!"               ', 126, 3.73, 17),
	(2814, 'Babička sa pýta vnuka: \r\n"Tak čo, Peťko, ako sa máš?" \r\n"No, ujde to, len s tvojou dcérou sú neustále problémy!"               ', 137, 3.89, 17),
	(2815, '„Filip, ako to, že máš také zablatené topánky? Veď dnes vonku žiadne blato nie je!?"\r\n„Ale je, len ho treba nájsť."               ', 144, 3.89, 17),
	(2816, 'Dcéra sa pozerá na mamu, ako si nanáša pleťovú masku a pýta sa jej:\r\n- Mami, prečo to robíš?\r\n- Aby som bola krásna.\r\nNeskôr večer, keď si ju dáva dole, sa jej dcérka spýta:\r\n- Vzdávaš to?              ', 221, 3.78, 17),
	(2817, '"Ocko, máš dobrú optickú pamäť?"\r\n"To mám synček. Prečo sa pýtaš?"\r\n"Práve som ti rozbil zrkadlo na holenie."              ', 135, 4, 17),
	(2818, 'Príde malý Ferko s kamarátom Jožkom za svojou 90-ročnou babičkou: \r\n„Babí, ty môžeš mať deti?" \r\nBabička s úsmevom: \r\n„Nie, Ferko, ja predsa nemôžem mať deti." \r\nFerko sa otočí na Jožka a zvolá: \r\n„No vidíš, hovoril som ti, že babka je samec!"\n', 273, 4.19, 17),
	(2819, '5-ročný Janko sa pýta rovnako starej Marienky:\r\n- Marienka, vydáš sa za mňa?\r\n- A dokážeš uživiť ženu s piatimi bábikami?              ', 148, 4, 17),
	(2820, 'Šofér zrazil sliepku. Schytil zrazenú sliepku za nohy a nesie ju k najbližšiemu domu, kde pred bránou stojí chlapec. \r\n”Počúvaj, je toto vaša sliepka?” \r\n”Pravdepodobne nie, pane. My také ploché nemáme.”              ', 238, 4.05, 17),
	(2821, 'Jožko sa vráti zo školy a mamička sa ho pýta:\r\n- Páčilo sa ti prvý raz v škole?\r\n- Áno.\r\n- Skúšalo sa?\r\n- Áno.\r\n- Prihlásil si sa?\r\n- Áno.\r\n- Vyvolala ťa pani učiteľka?\r\n- Áno.\r\n- A vedel si?\r\n- Áno.\r\n- A čo sa ťa pýtala?\r\n- Kto si prdol?              ', 275, 3.71, 17),
	(2822, 'Martin, ktorému mama zakázala sa kúpať v priľahlom rybníku, príde domov s mokrými vlasmi a hovorí, že spadol do vody.\r\n"Tak ako to, že nemáš mokré aj oblečenie?"\r\n"No, mal som také tušenie, že by som mohol spadnúť, a tak som si ich radšej vyzliekol."\n', 272, 3.55, 17),
	(2823, 'Príde malý Peťko k susedke a hovorí:\r\n"Dobrý deň, mamička sa pýta, či nemáte kilo múky, a keby tá stará krava nemala, tak sa mám spýtať vedľa."\n', 161, 3.77, 17),
	(2824, 'Pani učiteľka sa pýta detí, čo robia ráno, keď sa prebudia. Janko hovorí:\r\n"Ja ráno vstanem a idem sa vysrať!"\r\n"Janko, ty si ale sprostý. \r\nUčiteľka sa pýta Aničky, čo robí ona. Anička:\r\n"Ja ráno vstanem a čítam si knihu."\r\nPani učiteľka sa zaraduje:\r\n"A ako dlho si čítaš?"\r\n"No, kým sa nevyseriem!"\n', 329, 4.14, 17),
	(2825, 'Ide chlapík a vidí, ako sa malý chlapček naťahuje k zvončeku, ale nedočiahne. Chlap príde k dverám a hovorí:\r\n"Ukáž, ja zazvoním." \r\n"Dik, šéfe a teraz zdrháme!"\n', 178, 3.56, 17),
	(2826, 'Malé dievčatko zakoplo o kameň a povedalo:\r\n"Do riti, to bolí."\r\nOtec jej hovorí:\r\n"Ak toto škaredé slovo už nikdy nepovieš, dostaneš päťkorunu."\r\nZa pár dní pribehne dievčatko zo školy za ockom a nedočkavo\r\nhovorí:\r\n"Oci, mám nové slovo, ktoré je najmenej za dvacku!"\n', 290, 4, 17),
	(2827, 'Otec poslal syna za trest skoro spať. Za chvíľu sa z izby ozve:\r\n"Oci?\r\n"Čo je?"\r\n"Mám smäd. Mohol by si mi priniesť pohár vody?"\r\n"Nie. Mal si sa chovať lepšie. \r\n"A ak sa ešte raz spýtaš, tak ťa prídem vyplieskať!"\r\nO päť minút neskôr:\r\n"Ocii?"\r\n"ČO JE???"\r\n"Keď ma pôjdeš vyplieskať, mohol by si so sebou vziať pohár vody?"\n', 354, 4.28, 17),
	(2828, '"Je blbosť dedičná?"\r\n"Že sa nehanbíš, takto hovoriť o rodičoch."\n', 74, 4.2, 17),
	(2829, '"Ocko,v škole som dostal trojku!" \r\n"A z čoho Jožko?" \r\n"Z ničoho nič!"               ', 91, 4, 17),
	(2830, 'Hádajú sa 3 deti, kto má najmenšieho deduška :\r\n- Môj deduško je po kolená, hovorí prvé.\r\n- To je nič ! Môj deduško je po členky! - vraví druhé.\r\n- Môj deduško je v nemocnici, smutne vraví tretie.\r\n- A čo sa mu stalo ?\r\n- Ale zlomil si nohu, keď spadol z rebríka pri oberaní jahôd.              ', 319, 3.63, 17),
	(2831, 'Malé dievčatko zdvihlo telefón a po chvíli počúvania vraví:\r\n“A ktorý šéf môjho ocka vy ste? Ten tučniak, alebo ten debil?“\n', 140, 4.18, 17),
	(2832, 'Pýta sa vnúčik babky:\r\n- Babi, ten tvoj kohútik je chorý?\r\nOdkedy sa na neho pozerám, už tretia sliepočka ho nesie na chrbte.              ', 147, 4, 17),
	(2833, 'Pýta sa dieťa rodičov:\r\n- Žijú sardinky v mori?\r\n- Samozrejme.\r\n- A ako trafia do krabičky?                  \n', 116, 3.33, 17),
	(2834, 'Otec kúpe malého syna a vraví mu:\r\n- Tak vidíš, že ťa tiež viem okúpať.\r\n- Máš pravdu, ocko, ale mama mi najprv vyzuje topánky.\n', 141, 4.22, 17),
	(2835, 'Rodinný rozhovor:\r\n- Mama, volala si ma?\r\n- Nie.\r\n- Oco, ty si ma volal?\r\n- Nie.\r\n- Dobre! Tak sformulujem otázku inak: "My dnes nebudeme vôbec nic žrat??!!"              ', 175, 4.25, 17),
	(2836, 'Jožinko sa zdôveruje mame:\r\n- Mami, mne sa dnes snívalo o Aničke.\r\n- To nevadí, synček, ja to vyperiem...\n', 112, 4.22, 17),
	(2837, 'Mama kričí na malú Vierku, ktorá sa pri jedení zababrala:\r\n- Ty si ale prasiatko! Vieš vôbec, čo je to prasiatko?\r\n- Áno. Dieťa veľkej svine.\n', 153, 4.18, 17),
	(2838, 'Mama hovorí synovi u lekára:\r\n- Števko, stoj rovno, aby pán doktor videl, aký si krivý!              ', 107, 4, 17),
	(2839, 'Matka sa pýta dcéry:\r\n- Denisa, prečo sa nad tou krížovkou tak chichoceš?\r\n- Ale, je tu hlava rodiny na štyri a mne tu vyšlo otec.\n', 139, 4, 17),
	(2840, 'Otec so synom idú cez park a syn sa pýta:\r\n- Oci, kto je ten pán a tá slečna a čo v tom kroví robia?\r\n- Pozeraj sa inam, synček. Ale, keď už sa pýtaš, je to náš riaditeľ a jeho sekretárka. On jej akurát plánuje materskú dovolenku.\n', 250, 3.83, 17),
	(2841, 'Keď som sa narodil, lekár vošiel do čakárne a povedal môjmu otcovi:\r\n"Naozaj sme robili čo sme mohli, ale bohužiaľ sa pretlačil von."              ', 157, 3.36, 17),
	(2842, 'Malý Janko príde domov zo školy a vraví:\r\n- Oci, dostal som päťku, dúfam, že ma nehodíš do šachtyyyyyyyyy...              ', 133, 4.08, 17),
	(2843, 'Nepolepšiteľný chlapec sa dostal do katolíckeho ústavu. Po týždni prišiel úplne vymenený. Čo sa s tebou stalo? Vieš mama, prídem do študovne a tam jeden ukrižovaný. Prídem do jedálne a tam druhý... Tam sa s nikým nehrajú...               ', 259, 3.7, 17),
	(2844, 'V krčme:\r\n"Dobrý deň, prosím si jedno pivo."\r\n"A koľko máš rokov?"\r\n"Dovidenia."               ', 102, 3.77, 17),
	(2845, 'Janko príde ku sestre a pýta sa:\r\n-Prečo máš také veľké brucho?\r\n-Mám tam dieťa, odvetí sestra.\r\nJanko: no jasne, tak prečo si ho zjedla?              ', 163, 3.67, 17),
	(2846, 'Učiteľka vyvolá Janka, nech prečíta sloh na tému - Mama je len jedna. Janko číta: - Moja mama mi každé ráno pripraví skvelé raňajky, nachystá mi desiatu do školy, pribalí čokoládu, dá pusu na líčko a odvezie ma do školy. Mama je len jedna. Marienka napisala: - Mám rada svoju mamu. Vie sa pekne obliekať, chodí pekne upravená a stále na mňa myslí. Kupuje mi nové šaty a topánočky a veci do školy. Mama zarába veľa peňazí a chodíme spolu s mamou a ockom každý rok k moru. Mama je len jedna. Učiteľka dala obidvom jednotku. Napokon vyvolala Móricka. Móric napísal: - Minule som prišiel domov, zafajčený byt, v popolníku plno špakov, všade popol, rozhádzané fľaše od piva, matka vyvalená na gauči, v jednej ruke pivo, v druhej cigareta, kruhy pod očami a reve na mňa: "Moooooric ! V chladničke sú dve fľaše piva, dones ich sem!" \r\nPrídem ku chladničke, otvorím ju a kričím: \r\n"Mamaaaaaaaa, je len jednaaaa !"              ', 989, 3.82, 17),
	(2847, 'Riaditeľ veľkej spoločnosti potreboval zavolať jednému zo svojich zamestnancov ohľadom veľmi súrnej záležitosti. Zistil si jeho číslo domov, vytočil ho a ozval sa mu detský šepot:\r\n- Haló?\r\nRiaditeľ sa spýtal: - Je ocino doma?\r\n- Je, - zašepkal malý hlas.\r\n- A mohol by som s ním hovoriť?\r\nNa jeho prekvapenie malý hlas zašepkal: -Nie.\r\n- A mamina je doma?\r\n- Áno.\r\n- Môžem s ňou hovoriť?\r\n- Nie, - opäť zašepkal malý hlas.\r\n- Je tam ešte niekto dospelý?\r\n- Áno, policajt.\r\nRiaditeľ sa začudoval, čo robí policajt v dome jeho zamestnanca. Tak sa spýtal:\r\n- Môžem hovoriť s tým policajtom?\r\n- Nie, nemá čas. Hovorí s ocinom, maminou a tým hasičom, - zašepkal mu opäť malý hlas.\r\nSo vzrastajúcimi obavami a s pocitom, že v slúchadle začul zvuk helikoptéry, sa riaditeľ znovu spýtal:\r\n- Čo je to za zvuk?\r\n- Helikoptéra, - odpovedalo dieťa opäť šeptom.\r\n- Čo sa tam preboha deje?!\r\n- Práve pristála helikoptéra pátracieho tímu, - zašepkalo dieťa. Riaditeľ je už naozaj vystrašený:\r\n- Prečo tam sú?\r\nStále ešte šepkajúci detský hlas odpovedal s tlmeným chichotom:\r\n- Hľadajú ma.              ', 1177, 3.69, 17),
	(2848, 'Syn ide s otcom okolo erotického salóna a syn sa pýta:\r\n- Oci, čo je toto za dom?\r\n- To je dom radosti, synček?\r\n- Poďme tam!\r\n- Nevymýšľaj, na to si ešte malý.\r\nNa druhý deň zašiel zvedavý synáčik do domu radosti. Ako prvá si ho tam všimla kuchárka a hneď sa pýtala:\r\n- A ty tu čo robíš, chlapče?\r\n- Ocko hovoril, že toto je dom radosti, tak mi nejakú urobte.\r\nKuchárka mu teda urobila tri palacinky s čokoládou a keď prišiel domov hneď sa otcovi chválil, že bol v dome radosti. Prekvapený otec chcel hneď vedieť, čo tam robil.\r\n- Ale, - vraví syn - prvú som zvládol v pohode, druhá mi už dala trochu zabrať a tretiu som len roztiahol a vylízal.              ', 707, 3.7, 17),
	(2849, 'Príde malý vnúčik k babičke a vraví:\r\n”Babička, kúp mi horský bicykel.”\r\nBabička odpovie:\r\n”Ale Petrík, kde na to vezmem, veď z dôchodku sotva vyžijem. Poďme sa radšej na niečo zahrať.”\r\n”Tak sa poďme hrať na dedka a babičku.”\r\n”Dobre. Ale ja budem babka.” súhlasí babka. A tak ”dedko” vraví:\r\n”Babka, ľahni si do postele.”\r\n”Ale dedko, čo blázniš?”\r\n”Keď vravím ľahni si, tak si ľahni!”\r\nBabka si ľahne do postele a vnúčik vraví:\r\n”No, poležala si si babka? Tak teraz vstávaj a choď kúpiť vnukovi bicykel!”              ', 598, 3.44, 17),
	(2850, 'Mama príde so synom na nuda pláž a syn sa jej pýta mama to čo je za tlstého chlapa\r\nmama mu odpovie:to je bomba!\r\nsyn na to:tak utekajme lebo knôt už je malý!!!  ', 171, 3.43, 17),
	(2851, 'Rodičia malého Jožka sa vybrali do kina. Aby ich synček rýchlejšie zaspal, pustili mu rozprávku na gramofóne. Keď sa po dlhšom čase  vrátili domov, videli, ako si Jožko trieska hlavu o stenu a kričí: Chcem! Chcem! Chcem! ... A z gramofónu sa ozývalo: Chceš počuť rozprávku? Chceš počuť rozprávku? Chceš počuť rozprávku? ...', 352, 3.68, 17),
	(2852, 'Peťko sa pýta svojej tehotnej sestry:Janka,čo to tam máš?\r\nSestra:Bábo\r\nPeťko:A máš ho rada?\r\nSestra:Áno\r\nPeťko:Tak prečo si ho potom zjedla?? ', 155, 3.06, 17),
	(2853, 'Deti prečo tak prehrabujete piesok?\r\nAle hrali sme sa s detskom na pohreb a teraz nevieme kde sme ho zahrabali: :-)\r\n', 118, 3.34, 17),
	(2854, '-Ako sa volá tvoj otec,ty drzé chlapčisko?\r\n-Neviem.\r\n-A koľko máš rokov?!\r\n-Sedem.\r\n-Taký starý a nevieš, ako sa volá tvoj otec?!\r\n-No a čo, mama má tridsaťpäť a tiež to nevie!', 193, 3.92, 17),
	(2855, '-Naša učiteľka povedala,že škola je naším druhým domovom.Je to naozaj tak,ale ja budem v tom prípade radšej bezdomovec...', 131, 3.53, 17),
	(2856, 'Oci,po kom som zdedil rozum? " pýta sa doma malý Janko.\r\nUrčite po maminke. Ja ten svoj ešte stále mám..."', 112, 3.54, 17),
	(2857, 'Do mestskej knižnice príde školský zájazd. Deti chodia pomedzi regály a pozerajú na vystavené knihy. Zrazu Jožko hovorí kamarátovi:\r\nAha, táto môže byť zaujímavá: Mníchov 1938."\r\nPanebože, toľko mníchov!"', 225, 3.25, 17),
	(2858, 'Mama nesie z pivnice zemiaky, medzi ktorými sedí ropucha.\r\nMalý Janko kričí:\r\nMamička, jeden zemiak na mňa žmurká!', 123, 2.85, 17),
	(2859, 'Mama češe synčeka a hovorí mu: -Milanko drž pekne hlavu, urobím ti rovnú cestičku\r\nMilanko na to:\r\n-Mamička, ale urob mi na nej aj autíčko.', 150, 2.84, 17),
	(2860, '"Dominik, prečo trháš v kalendári každý deň tri listy naraz? "zaujímala sa stará mama.\r\n"aby boli čím skôr prázdniny, "odvetil pohotovo vnuk.\r\n', 156, 2.73, 17),
	(2861, 'Päťročný chlapec sa pýta mamy:\r\n-Mamička, máš ma rada?\r\n-Pravdaže!\r\nTak sa rozveď s otcom a zober si uja, čo predáva zmrzlinu.', 138, 3.17, 17),
	(2862, 'Malý Janko je prvý deň v škôlke.\r\nChystajú sa na vychádzku, no Janko si nevie obuť topánky.\r\n-Ukáž ,pomôžem ti-"vraví učiteľka.\r\nNamáha sa, naťahuje, krúti, no nič.\r\nTopánky mu nevie navliecť.\r\n-Ale dávate mi ich naopak-."povie Janko.Učiteľka ich naťahuje správne, no nie a nie ich obuť.\r\n-Ale to nie sú moje topánky.-"ozve sa o chvíľu chlapček. Učiteľka sa ovláda, aby nevybuchla a potom povie:\r\n-Dobre, tak ti obujem tie tvoje.-\r\nNamáha sa, potí sa a napokon povie:\r\n-Tak čo, už je to dobré?-\r\n-Áno.-\r\n-No a Teraz si natiahni rukavičky.-\r\nJanko na to:\r\n-Nemôžem, sú v topánkach.-', 628, 3.31, 17),
	(2863, 'Janko sa pozerá na svadobnú fotku maminky a otecka a odrazu sa spýta maminky.\r\n-"Maminka prečo si v bielych svadobných šatách a nie iných?"\r\n-"Lebo biela symbolizuje šťastie, synček"\r\n-"A prečo je ocko v čiernom?"', 226, 3.9, 17),
	(2864, 'Rodičia malého Jožka sa vybrali do kina. Aby ich synček rýchlejšie zaspal, pustili mu rozprávku na gramofóne. Keď sa po dlhšom čase vrátili domov, videli, ako si Jožko trieska hlavu o stenu a kričí: Chcem! Chcem! Chcem! ... A z gramofónu sa ozývalo: Chceš počuť rozprávku? Chceš počuť rozprávku? Chceš počuť rozprávku? ...', 351, 3.77, 17),
	(2865, 'Sedí babka v električke a pri nej chlapec, ktorému tečie dlhý sopeľ z nosa. Babka sa ho pýta, že či nemá servítku chlapec na to mám ale nedám.', 155, 2.96, 17),
	(2866, 'Syn prinesie päťku a otec mu hovorí:\r\n-,,Ešte raz tak si ma nepraj!"\r\n-,,Oci, ale ja som si ťa neprial, tí dvaja pred tebou boli lepší!\r\n', 145, 3.54, 17),
	(2867, 'Príde mníška do lekárne a pýta si antikoncepčné tabletky. Lekárka jej hovorí: Ale vy ste mníškaTo nie pre mňa to pre moju dcéru', 140, 3, 17),
	(2868, 'Pýta sa učiteľka malého Janka aký je to čas ja sa kúpem ty sa kúpeš on sa kúpe Janko na to sobota večer pani učiteľka', 130, 2.55, 17),
	(2869, 'Peťko príde do lekárne a pýta sa:\r\n- Prezervatívy máte?\r\n- Po prvé, - hovorí nahnevaná magistra - prezervatívy nie sú pre deti a po druhé, povedz otcovi, nech príde sám a vyberie si podľa jeho rozmeru.\r\n- Po prvé, - odvetí Peťko - prezervatívy nie sú pre deti, ale proti deťom, a po druhé, nebudem otcovi\r\nnič hovoriť, do kúpeľov ide mama a ešte nevie, aký rozmer bude potrebovať...', 411, 3.58, 17),
	(2870, 'Sedia v piesku dvaja chlapci a rozprávajú sa. \r\n- Koľko máš rokov? pýta sa jeden druhého.\r\n- štyri a ty? pýta sa druhý.\r\n- Ja ani neviem... priznáva sa ten prvý.\r\n- Zistíme. Piješ?\r\n- Pijem!\r\n- A fajčíš?\r\n- No fajčím!\r\n- A čo, droguješ?\r\n- Drogujem!\r\n- A súložil si už?- pýta sa ten starší.\r\n- A to je čo?\r\n- Ach tak, ty máš ešte len tri!', 369, 3.33, 17),
	(2871, 'Malý Janko sa pozerá Aničke pod sukňu a hovorí jej:\r\n-Anička veď ty máš tangáče naopak!\r\nAnička sa ho pýta.\r\n-Mám čipku vzadu??\r\nA Janko na to:\r\n-Nie, hnedú čiarku vpredu!!!-', 191, 3.46, 17),
	(2872, 'Janko s Marienkou idú po lese na bicykli a veľmi škaredo spadnú... Marienka má roztrhané ústa od ucha k uchu a Janko jej hovorí: "Čo sa smeješ ako sprostá, veď sme sa mohli aj zabiť!!', 196, 3.92, 17),
	(2873, 'Dieťa napochoduje s previnilým výrazom na tvári do rodičovskej spálne, len čo sa večer zhasne:"Tati, vieš písať aj, keď je tma?"  "No, myslím, že áno. Čo mám napísať?"  "Svoje meno do mojej žiackej knižky."                ', 243, 3.6, 17),
	(2874, 'Peťko príde do lekárne a pýta sa:\r\n- Prezervatívy máte?\r\n- Po prvé, - hovorí nahnevaná magistra - prezervatívy nie sú pre deti a po druhé, povedz otcovi, nech príde sám a vyberie si podľa jeho rozmeru.\r\n- Po prvé, - odvetí Peťko - prezervatívy nie sú pre deti, ale proti deťom, a po druhé, nebudem otcovi nič hovoriť, do kúpeľov ide mama a ešte nevie, aký rozmer bude potrebovať...', 410, 3.89, 17),
	(2875, 'Fero pozerá telku, príde za nim malý Ferko a pýta sa ho:\r\n- Ocko, aký je rozdiel medzi potencionálne a reálne?\r\n- Hmm ... - odvetí Fero - akoby som Ti to ... no choď sa spýtať mamy, či by sa za milión eur vyspala s Kevinom Costnerom, tvojej sestry či by sa za milión eur vyspala s Tomom Cruisom a tvojho brata či by sa za milión eur vyspal s Bradom Pittom.\r\nZa chvíľu sa malý vráti a referuje:\r\n- Mama povedala, že by sa s ním vyspala aj za menej, sestra že je to jej sen a môj brat povedal, že za milión eur by dal aj Eltonovi Johnovi.\r\n- Tak vidíš, - dovysvetlí Fero - teraz to pochopíš. Potencionálne by sme sa stali milionármi a reálne máme doma dve kurvy a jedného teploša.', 716, 3.78, 17),
	(2876, 'Na pohotovosti zvoní telefón: ”Pán doktor, rýchlo príďte, malý zjedol prezervatív!” O chvíľku zvoní telefón znova: ”Pán doktor, už nemusíte, našli sme druhý.”', 183, 3.57, 17),
	(2877, 'Janko sa pýta dedka: \r\n- Dedko, máš zuby? \r\n- Kdeže vnúčik, nemám. \r\nJanko okamžite na to: \r\n- Tak mi podrž môj chlebík.', 131, 4, 17),
	(2878, '"Mám starosti, Hanka."\r\n"Aké Katka?"\r\n"Otecko je čoraz roztržitejší."\r\n"A ako sa to prejavuje?"\r\n"Rozlične. Napríklad dnes ráno pobozkal vajíčko a mamu ťukol lyžicou po hlave."', 189, 3.75, 17),
	(2879, '"Ocko mi za pekné vysvedčenie nasľuboval hory-doly."\r\n"Ale sľub nesplnil, však?"\r\n"Ako sa to vezme. Kúpil mi atlas."', 122, 3, 17),
	(2880, 'Ide Janko s Marienkou na bicykli a zrazu spadnú.  \r\nMarienka kričí: "Janko, Janko spadla som na kolienko a teraz ma veľmi bolí." A Janko na to: "No a čo, ja mám gule v retiazke!"', 185, 3.44, 17),
	(2881, 'Príde učiteľka do triedy a pýta sa Jožka: \r\n- Jožko, aké bicie nástroje poznáš?\r\n- No, tak to máme varechu a remeň.', 127, 3.89, 17),
	(2882, 'Sedia tri malé deti v jasliach na nočníkoch a vravia: "Pôjdeme do lesa?" "Pôjdeme." "A nočníky si vezmeme so sebou?" "Vezmeme."Len tretie najstaršie hovorí: "Do riti pôjdeme, keď chodiť nevieme."', 207, 3.26, 17),
	(2883, 'Tehotná mamička sa pýta synčeka, čo by chcel na Vianoce, či bračeka alebo sestričku. "No, ak by ťa to neroztrhalo, tak radšej by som chcel sánky." ', 158, 3.97, 17),
	(2884, '- Mamička bolia ťa nôžky? - Áno dcérenka, bolia. - A rúčky? - Áno bolia, nesiem veľmi ťažké tašky.- Mamička ja ti pomôžem, vezmem ti obidve tašky a ty ma vezmeš na ruky...', 190, 3.48, 17),
	(2885, 'Zvoní telefón. Jožko ho zdvihne a volajúci sa pýta: "Máš doma mamu alebo otca?" "Nie, sú zaneprázdnení." "A nie je pri tebe ani policajt, záchranár alebo hasič?" "Nie, aj tí sú zaneprázdnení." "A čo robia?" "Hľadajú ma!"', 240, 3.21, 17),
	(2886, 'Malý Janko sa pýta ocka: "Oci, ty si v noci niekoho zabil???"- "Nie, prečo?"- "Lebo som v noci počul maminku hovoriť Toho už nechaj, ten už nevstane..."', 159, 3.8, 17),
	(2887, '"Oci, chcel by som pomôcť jednému starčekovi. Dáš mi na to päť korún?"\r\n"Pravdaže synu, to je od teba veľmi šľachetné. Tu máš dvacku. A kde je ten úbohý starček?"\r\n"Tamto na rohu. Predáva zmrzlinu..."', 220, 3.7, 17),
	(2888, 'Malý Janko pristihne mamu a otca tesne pred vyvrcholením. Otec nestráca duchaprítomnosť a vraví Jankovi: "Janko, čo by si chcel viac brata alebo sestričku?" "Ja chcem koníka." "Ale to sa nedá." "Tak zlez oci, skúsim to ja."      ', 240, 3.94, 17),
	(2889, 'Príde k chlapčekovi cudzí ujo a pýta sa ho:\r\n- Ako sa voláš?\r\n- Tak ako môj otec.\r\n- A ako sa volá tvoj otec?\r\n- Tak ako ja.\r\n- A ako sa voláte obaja?\r\n- Rovnako.', 171, 3.69, 17),
	(2890, 'Zhovárajú sa dvaja škôlkári:\r\n- Aký budete mať stromček?\r\n- Umelý.\r\n- A bol už u vás mikuláš?\r\n- Bol tiež umelý.', 127, 3.39, 17),
	(2891, 'Chlapec príde plačúc domov a sťažuje sa mamke:\r\n- Mamíí, v škole sa mi smejú, že mám veľkú hlavu!\r\n- Ale kdeže Peťko, to vôbec nie je pravda. Ale teraz choď pekne do pivnice a dones mi, prosím ťa, do šiltovky zo päť kíl zemiakov.', 252, 3.51, 17),
	(2892, 'Otec so synom sedia pri stole.\r\nOtec: "Synu, synu.. Ty si sprostý ako toto drevo." A poklopká  na stôl.\r\nSyn: "Tato! Dakto klopal!"', 134, 3.65, 17),
	(2893, 'Deti píšu v škole sloh na tému: - Som riaditeľom veľkej firmy.\r\nKaždý píše len Móricko si spokojne sedí. Príde za ním pani učiteľka a pýta sa: - Móricko, prečo nepíšeš? A Móricko na to: - No dovoľte, čakám na svoju sekretárku...', 255, 3.97, 17),
	(2894, '- Mamy bolia ťa nôžky? Aj ruky? - Áno dcérka, bolia. Nesiem ťažké tašky.\r\n- Mamička, ja ti pomôžem. Zoberiem ti obidve tašky, a ty ma zoberieš na ruky...', 167, 3.37, 17),
	(2895, 'Ivanko sa pýta mamičky: "Prečo si ma mala v brušku?" Mamička odpovie: "Lebo som bola tehotná."A Ivanko sa znova opýta: "A tak prečo si ma vyčúrala?"', 158, 3.59, 17),
	(2896, 'Mamička, prečo sa maľuješ?\r\nAby som bola krajšia.\r\nA kedy budeš?', 70, 3.81, 17),
	(2897, 'Ide Jožko do obchodu a pýta si kakao.\r\nPredavačka mu hovorí: "Dneska kakao nemáme!"\r\nNa druhý deň si Jožko zase pýta kakao a znova mu predavačka hovorí: " Nemáme!"\r\nNa tretí deň si opäť pýta kakao. Predavačka mu zvýšeným hlasom odpovie: Nemáme, ale ak sem ešte raz prídeš, zavesím ťa na klinec!"\r\nNa štvrtý deň sa Jožko pýta: " Máte klinec?"\r\nPredavačka odpovie: "Nemáme"\r\nA Jožko pokračuje: "A kakao máte?"\r\nPredavačka ho zavesí na klinec vedľa obrazu prezidenta. Jožko sa pozrie na obraz a vraví:" Aj ty si chcel kakao?" ', 566, 3.34, 17),
	(2898, 'Viete prečo sa Janko Hraško nesprchoval?\r\nLebo by vyklíčil.\r\n', 65, 4.06, 17),
	(2899, 'Sedia dvaja malí prváci a jeden hovorí druhému: \r- Už len 54 rokov a ideme do dôchodku.', 93, 3.54, 17),
	(2900, 'Pani učiteľka sa pýta žiakov aké majú domáce zvieratko. A Janko odpovedá:\r\n-zamrznutú sliepku v mrazničke', 115, 2.93, 17),
	(2901, 'Vojde malý chlapec do obchodu so zeleninou a pýta sa predavačky:\r\n"Teta, máte mrkvu?"\r\n"Máme, chlapče, máme."\r\n"Tak si ju strčte do riti!"\r\n"Ako???!!"\r\n"Vňaťou vonku!"', 177, 4.03, 17),
	(2902, '- Jožko, čo stojí ten pes?\r\nJožko: -Ja neviem, čo si nesadne.\r\n- Ale ja myslím, že koľko stojí?\r\nJožko: -No už hádam aj polhodinu.\r\n', 144, 4.09, 17),
	(2903, 'Mamička hovorí synovi:\r\n- Janko, požičaj aj Aničke sánky!\r\nJanko odpovedá:\r\n- Jasné mami, my sa striedame. Anička chodí hore a ja dolu.', 145, 4.15, 17),
	(2904, 'Viete prečo sa všetci boja Jožka z 1.B?\r\nLebo jeho otec je v 7.Aa', 68, 4.18, 17),
	(2905, 'Dcéra prechádzajúca pubertou sa očividne nevie zmestiť do kože a vykrikuje na svoju mamu z jednej izby do druhej: "Mami, dones mi pohár vody z kuchyne!" \rChvíľu sa nič nedeje, a preto dcéra znova kričí cez celý byt: "Mami, čakám na tú vodu." \r"Ja ti dám pohár vody," zvolá mama, vyvedená z miery drzosťou svojej dcéry, ale už stratí nervy a nahnevane jej pohrozí, "vezmem remeň, čo visí na kľučke, a sľubujem, že ťa tak strašne zderiem po holej riti až ju budeš mať celú fialovú!" \r"No vidíš mami," provokuje ďalej drzá dcéra, "keď už budeš na ceste s tým veľkým remeňom, nezabudni láskavo zobrať aj ten pohár s vodou."', 674, 4.02, 17),
	(2906, 'Pani učiteľka sa pýta detí v triede ako robí kohút. \r\nPrihlási sa Maťko a vraví: „Kikirikkííí“. \r\nPani učiteľka Maťka pochváli. Potom sa pýta ako robí sliepka. \r\nA Maťko zase odpovedá: „Kotkotkoodááák“. \r\nZnova ho pani učiteľka pochváli. Treťou otázkou sa pani učiteľka Jožka pýta ako robí sviňa.\r\nJožko odpovedá: „No, tak keď sme boli s ockom v autoservise, tak tam bola jedna sviňa a ona robila: Prosím si váš vodičský a vaše doklady.“\r\n', 495, 3.57, 17),
	(2907, 'Dve babätká sa rozprávajú v pôrodnici: - Ahoj, ja som chlapček. - Ako vieš? - pýta sa druhé bábätko. - Počkaj, kým odíde sestrička, potom ti niečo ukážem. Keď sestrička odíde, chlapček si odhrnie deku a hrdo povie: ...... - Aha, mám modré ponožky:', 272, 3.65, 17),
	(2908, 'Malý Ferko ide s babkou po ulici, keď zrazu zbadá na zemi 5 eur. Chce ich zdvihnúť, ale babka ho zahriakne a povie mu, že špinavé veci sa zo zeme nezdvíhajú. Zrazu sa babka šmykne na blate, spadne a Ferkovi vraví, aby ju zdvihol. \r\nNo Ferko odpovie: „Špinavé veci sa zo zeme nezdvíhajú.“\r\n', 309, 3.91, 17),
	(2909, 'Jožko príde domov zo školy a vraví:\r\nMami, mami, už som sa naučil počítať do 10.\r\nA mama mu hovorí:\r\nNo tak mi to povedz.\r\n1, 2, 3, 4, 6, 7, 8, 9, 10\r\nA kde si nechal 5-ku?\r\nV žiackej knižke.', 203, 3.63, 17),
	(2910, '‎- Ocko, vodka zdražela. Budeš menej piť!\r- Nie synku, ty budeš menej jesť.', 82, 4.17, 17),
	(2911, 'Príde Janko zo školy a je celý mokrý, od chodidiel až po kolená. Mama sa ho pýta:\r\n„Čo sa ti stalo? Spadol si do potoka?“\r\nJanko jej odpovedá: „Nie, hrali sme sa na psy, mami.“\r\n„No a?“ – pýta sa mamička.\r\n„A ja som bol stĺp..“ – odpovedá Janko.\r\n', 280, 3.91, 17),
	(2912, 'Príde Peťko v noci do spálne a vidí ako mamička leží na oteckovi.\r\nRáno otec nadáva Peťkovi prečo prišiel v noci do spálne, keď mohol mať sestričku. Ale Peťko kričí, že nechce!\r\nNasledujúcu noc sa to zopakuje a vidí ako otecko leží na mamičke. \r\nRáno mu zase otecko nadáva, že mohol mať bračeka. A Peťko zase kričí, že nechce!\r\nA tretiu noc príde Peťko do spálne a kričí, že nechce ani psíka!!!', 435, 4.02, 17),
	(2913, 'Detičky majú v škole nemčinu a majú hovoriť názvy kvetov.\r\nAnička: Die Rose.\r\nUčiteľka: Schon, Anička, schon.\r\nJanka: Der Tulipan.\r\nUčiteľka: Schon, Janka, schon.\r\n...Móricko: Der Orgasmus.\r\nUčiteľka: Móricko, ale veď to nie je kvetina.\r\nMóricko: Nie, ale tiež je to schon.\r\n', 295, 4.21, 17),
	(2914, 'Janko sa hrá na pieskovisku a ide okolo policajt. \r\n- Čo to robíš Janko ? \r\n- Miešam h*vn* s pieskom.\r\n- Čo z toho bude ? \r\n- POLICAJT.\r\n- Ten vyberie obušok a milého Janka zmláti ako hada.\r\nNa druhý deň sa situácia opakuje, ale pri otázke "Čo z toho bude?", Janko odpovedá: "Kačička". \r\n-A prečo nie policajt ? \r\n- Lebo mám malo hov**n.', 356, 4.21, 17),
	(2915, 'Ide Jožko k dedkovi a pýta si knihu.\r\nVráti sa domov, ale onedlho príde za dedom a pýta si este väčšiu knihu. Po chvíli sa vráti a hovorí dedkovi: Ty dedo, daj mi tu najväčšiu knihu akú máš!\r\nDedko: No ale Jožko, toto je veľká kniha na tak malého chlapca.\r\nJožko: Nevadí... však mi ju pomôž odniesť.\r\nPrídu domov a Jožko hovorí: Tu mi ju polož do kuchyne.\r\nPostaví sa na knihu, otvorí poličku, vyberie cukríky a hovorí: Dedko, už si môžes tú knihu zobrať späť.', 503, 3.79, 17),
	(2916, 'Mamička sa pýta synčeka: Janko prečo si si nalepil oteckovu fotku do zošita?\rJanko odpovedá: Lebo pani učiteľka by rada videla toho debila, čo mi robil domácu úlohu.', 176, 4.08, 17),
	(2917, 'Malý braček sa pýta veľkej sestry:\r- Sestrička, čo máš v tom bruchu?\rSestra odpovedá:\r- Dieťatko.\rBrat sa pýta:\r- A máš ho rada?\r- No jasné.\r- Tak prečo si ho zjedla?', 181, 4.2, 17),
	(2918, 'Syn sa pýta otca:\r- Otecko, prečo strieľaš na babku?\rOtec na to:\r- Niekomu babka a niekomu svokra!', 102, 4.07, 17),
	(2919, 'Oci, po kom som zdedil rozum? " pýta sa doma malý Janko.\r\nUrčite po maminke. Ja ten svoj ešte stále mám..."', 113, 3.93, 17),
	(2920, 'Učiteľka hudobnej výchovy sa pýta Janka:\r- Janko, aké poznáš bicie nástroje?\r- Remeň môjho otca.', 106, 3.7, 17),
	(2921, 'Pán Kováč sa pýta svojho desaťročného syna:\r\n- Ako stojíš v škole?\r\n- Dobre, každý deň v inom kúte.', 113, 4, 17),
	(2922, 'Učiteľka sa pýta Dežka:\r\n- Dežko, skloňuj slovo chlieb.\r\n- Kto? Čo? Chlieb.\r\n- S kým? S čím? So salámou.\r\n- Komu? Čomu? Mne!', 136, 4.08, 17),
	(2923, 'Otec karhá svojho syna:\r- Namiesto toho, aby si sa venoval štúdiu, beháš za babami!\r- Ale ocko, to je trochu inak...\r- Žiadne ale! Kto je tu otec, ty alebo ja?!\r- Obaja, otec, obaja...', 190, 4.08, 17),
	(2924, 'Malý Jurko hrá na husliach a robí strašný rámus. Keď to zistí jeho otec, nahnevaný vbehne do jeho izby a skríkne:\r- To mi nemôžeš povedať, že hráš na husliach? Ja už tu pol hodiny márne olejujem dvere!', 220, 3.85, 17),
	(2925, 'Niektoré deti sú ako kliešť.\r\n???\r\nDržia sa?\r\nNie. Hlava zostane vnútri. ', 79, 2.79, 17),
	(2926, 'Jožo uteká pred komármi a kričí: Komáre nebláznite, na darovanie krvi som ešte primladý.', 97, 3.18, 17),
	(2927, 'Jedno pivo a hot-dog s horčicou.\r\n- A 18 máme?\r\n- Tak s kečupom...', 69, 3.82, 17),
	(2928, 'Janko sa pýta otca:\r-Oci, vyzná sa babka do automatických prevodoviek?\r-Nie.\r-A do dieselových motorov?\r-Nie.\r-Tak potom prečo leží pod autobusom?', 153, 3.98, 17),
	(2929, 'Janko sa pýta otecka: Môžem sa pozerať na televíziu?\r\nOtecko: Áno, ale nezapínaj ju!', 91, 3.8, 17),
	(2930, 'Janko kričí z obývačky:\r\n-"Mami, mami stromček horí!"\r\nMama kričí z kuchyne:\r\n-"Janko nehovorí sa horí, ale svieti."\r\nO chvílu Janko znova kričí:\r\n-"Mami, mami už aj záclony svietia!"', 198, 3.95, 17),
	(2931, 'Roztúžená babka hovorí dedkovi:\r\n"Miláčik, urob si dobre!"\r\nDedko vstane, vyberie fľašu z chladničky a vypije ju. Starká o chvíľu hudie zase:\r\n"Starký, no veďže si urob dobre..."\r\nOn vyskočí, vyberie poslednú fľašu z chladničky a aj tú vypije. Manželka mu nakoniec vraví:\r\n"Zlatko, urob si dobre, ale na mne!"\r\nDedko tackajúc sa, vstane, sadne žene na chrbát a šušľajúc zavelí:\r\n"A dža, baba, do špajze!              ', 451, 3.26, 18),
	(2932, 'Chlapík zbadá dedka, ktorý šúcha za sebou pravú nohu. Pýta sa ho:\r\n"Od vojny, od vojny?"\r\nDedko odpovedá:\r\n"Nie, od hovna, od hovna..."              ', 157, 4.03, 18),
	(2933, 'V noci hovorí babka:\r\n"Dedko, ako to, že ho máš dnes takého hrubého?"\r\n"Ale, preložil som si ho napoly."              ', 125, 3.69, 18),
	(2934, 'Prechádza sa dedko po kostole, pristaví sa pri soche Ježiša a pýta sa ho:\r\n"Ježiš, keď zomriem, čím budem v druhom živote?"\r\n"Budeš hrať futbal!" Ježiš na to.\r\n"Ale ja som v živote futbal nehral!" oponuje dedko.\r\n"To nič," hovorí Ježiš, "trénuj, o týždeň máš zápas."              ', 307, 3.63, 18),
	(2935, 'Na ulici zastaví prostitútka dedka a hovorí mu:\r\n"Dedko, chceš si so mnou trochu užiť?"\r\nDedko vytiahne 500 korún a podá ich dievčine.\r\n"Dedko, ale veď ešte nič nebolo."\r\n"Za dôveru, dievča, za dôveru."              ', 231, 3.33, 18),
	(2936, 'Stojí starček pred obchodom s obuvou a mrmle si:\r\n"Je to pravda, že móda sa vracia, pred sedemdesiatimi rokmi som chodil bosý a teraz budem znova."\n', 153, 3.21, 18),
	(2937, 'Imriško postáva pred zrkadlom a hladká si plešinu.\r\n"Si chlapík" vraví sám sebe, "sedemdesiatka na krku a nijaký šedivý vlas!"              ', 150, 3.74, 18),
	(2938, 'Ide dedko o polnoci na záchod. Vráti sa celý vystrašený a hovorí babke: "Babka, my máme na záchode duchov. prišiel som, samé sa zažalo, odišiel som, samé sa zhaslo" babka sa otočí a celá rozhorčená hovorí dedkovi: "Dedko, ty si sa zase vysral do chladničky!"              ', 292, 3.97, 18),
	(2939, 'Ide dedko na bicykli a zastaví ho zbojník:\r\n- Dedko, dušu alebo peniaze?\r\nDedko odpovedá:\r\n- Prednú alebo zadnú?              ', 132, 3.67, 18),
	(2940, 'Dedko príde na verejné WC, rozopne si zips na nohaviciach, dá ruky za chrbát, a začne močiť. Moč mu strieka na všetky strany, a chlapík vedľa neho odskočí, a hovorí mu:\r\n- To si ho neviete chytiť normálne do ruky ?\r\n- Kto ma raz zradil, tomu ruku nepodám.              ', 286, 4.1, 18),
	(2941, 'Vnučka sa pýta dedka:\r\n- Dedko, ako zistím, že som opitá?\r\nDedko pozrie cez okno a vraví:\r\n- Keď uvidíš tamtie dve, ako štyri.\r\n- Dedko?\r\n- Čo?\r\n- Tam je len jedna!              ', 189, 3.78, 18),
	(2942, 'Ide babka do obchodu a pýta si sardinky. Predavačka sa pýta:\r\n- A aké ?Chorvátske, grécke, španielske...\r\n-To je jedno, veď sa s nimi nebudem rozprávať!              ', 176, 3.72, 18),
	(2943, 'Viete čo má babka medzi prsiami?\r\nPupok              ', 55, 3.9, 18),
	(2944, 'Sedí dedko \'dole bez\' na priedomí. Príde za ním vnúčik a pýta sa:\r\n"Dedko, prečo tu sedíš od pol pása dole nahý?"\r\n"Ále vieš, vnúčik môj, včera som tu sedel od pol pása hore nahý, stuhol mi chrbát, no a toto je výmysel tvojej babky!"              ', 269, 3.94, 18),
	(2945, 'Ide babka do obchodu a spomenie si, že zabudla vypnúť sporák. Tak sa aspoň pomodlí: \n"Anjeličku, môj strážničku, ochraňuj moju dvojplatničku a prepni zo šestky na jedničku."              ', 202, 3.45, 18),
	(2946, 'Dedko vracia kondómy v drogérii. Predavačka sa ho pýta: \n"Čo sa stalo, dedko, čo sú deravé?" \n"Deravé nie, ale ohýbajú sa."              ', 148, 3.9, 18),
	(2947, '\nStretnú sa dvaja starí páni. \n"Ako sa máte?" pýta sa prvý. \n"Nie je to so mnou dobré, močím stále vyššie" ťažká si druhý. \n"Čo sa vám na tom nepáči? Ste na tom ako mladík!" \n"Kdeže mladík! Pred mesiacom som si ešte močil na špice topánok, teraz už na kolená."              ', 303, 4.08, 18),
	(2948, 'Ferko sa chváli pani učiteľke:\n"Môj dedko vie, ako robí sova..."\nAha!\nDedo, povedz, kedy si sa naposledy\nmiloval???\n.....hu hu hu hu......              ', 157, 3.79, 18),
	(2949, 'Stretnú sa tri babičky a chvália sa svojimi vnukmi.\n"Môj bude doktorom. Stále sa hrá s ampulkami a striekačkami, niečo si pichá."\n"Môj bude asi agronóm. Sadí na záhrade konope a mak a čaká na úrodu."\n"Môj bude určite šofér. Namočí si handru do benzínu, hodí si ju na hlavu a povie:\n"Teraz ma neruš babi, bude jazda."              ', 355, 3.85, 18),
	(2950, 'Chodí dedo po nemocničnej chodbe a mrmle si: "Žabu? Hmmmm... Nie, žabu nie. Mloka? Hmmmm... Nie, mloka tiež nie..." \nIde okolo sestrička, poklepe deda po chrbte \na vraví: \n"Raka máte dedo, raka."              ', 217, 3.67, 18),
	(2951, 'Dedko s babkou ležia v posteli. Babka sa pýta: "Na čo si myslel takto pred 50 rokmi?" \n"Na to, ako ťa pomilujem tak, že prídeš \no rozum, a prsia ti vysajem do sucha." \n"A teraz myslíš na čo?" pýta sa babka \ns nádejou v hlase. \n"Na to, že sa mi to podarilo..."              ', 286, 3.88, 18),
	(2952, 'Otázka na rádio Jerevan.\nAký je rozdiel medzi hrnčekom bez uška a dôchodcom?\nŽiaden, niet za čo chytiť.              ', 126, 2.92, 18),
	(2953, '"Dedko, došla nám múka. Zober tašku a choď do obchodu." \n"Ale babka, veď vonku leje, ani psa nehodno vyhnať z domu..." \n"A kto ti káže vziať psa so sebou?"\n', 166, 3.71, 18),
	(2954, 'Pride starka za starkym a hovori:"starky pod sa poslednýkrát pomilovať."\nStarký hovorí:"starka ked spraviš búrku tak pojdem."starka robi, blesky burku, prsi a pýta sa tak co starký ideme?\nStarký:"co ti šibe v takom pocasi?"              ', 248, 3.48, 18),
	(2955, 'Prechádza stará babka cez cestu a policajt na ňu kričí: "Babka a po prechode by to nešlo?" \nA babka mu na to: "Išlo, chlapče išlo, ale nie si môj typ."\n', 162, 4.13, 18),
	(2956, 'Kto má najvačšie oči?\nBabka bez kysliku.              ', 58, 3.52, 18),
	(2957, 'Vnučka pripravuje zábudlivú babku na príchod jej bývalých kolegýň z práce,ako ich má správne uvítať! Hovorí vnučka:,,Najprv im ponúkneš kávu,potom zákusok,potom im dáš obed.Budeš si to pamätáť,babka?"\n,,Pravdaže budem!hovorí babka"\nPrídu babkine (tiež zábudlivé) kolegyne na návštevu a babka sa pýta,či si nedajú kávu. Oni hovoria že áno. Prešlo pár hodín a babka zabudla že už pili kávu a pýta sa. Nedáme si kávu? Áno,hovoria aj ostatné. Tak si dali kávu. Po ďalšej hodinke už mala podávať obed,ale zabudla že pili kávu,tak sa znovu opýta.Dáme si kávičku? Áno,hovoria aj ostatné,dáme si kávičku! Kolegyne sa zrazu pozrú na hodinky a hovoria,že už musia ísť. Tak ich babka vyprevadí a oni ako tak idú vo výťahu dole si hovoria o tej babke. No to je úroveň,aká skúpa je tá naša bývalá kolegyňa, ani kávu nám neponúkla!!!              ', 921, 3.1, 18),
	(2958, 'Starenka navštívila svoju sestru v dome dôchodcov. Pýta sa jej:\n"Tak ako sa ti tu páči?"\n"Veľmi!" teší sa sestra. "Je tu taká krásna atmosféra vzájomnej úcty. Je tu jeden muzikant, má už 85 rokov a 20 rokov nehrá, no každý mu tu hovorí maestro. Je tu tiež jeden bývalý lekár, ktorý už 30 rokov nelieči a každý mu tu hovorí pán doktor..."\n"A čo ty?"\n"No, napríklad ja som už 30 rokov nesúložila a stále ma tu volajú ´tá stará štetka´."              ', 491, 4, 18),
	(2959, 'Má to 100 očí a jeden zub. Čo je to?\nDom dôchodcov              ', 69, 3.7, 18),
	(2960, 'Vraví babka dedkovi. Dedko, poďme robiť to čo za mladi. Dedko súhlasí. Vojde do pivnice a čaká na babku. Babka nechodí hodinu, dve, tri... Dedko nasratý vybehne hore a hovorí. Babka, kde si tak dlho. Naši ma nepústili...              ', 247, 3.92, 18),
	(2961, 'Ide babka na WC a namiesto do ženského vojde do mužského. Tam ju zastaví muž a hovorí: \r\n”Babka, sem nemôžete ísť, to je iba pre pánov.” \r\n”No a čo, a chudoba sa má posrať!?”              ', 211, 3.81, 18),
	(2962, 'Dievča sa pýta babky:\r\n-"Babka prečo máš také veľké nohy?"        \r\n-"Aby mi lepšie šmerdzeli"              ', 118, 3.83, 18),
	(2963, '- Lekár babke: Babka uvoľnite sa.\r\n- A babka:Pŕŕŕŕŕŕd.              ', 76, 3.96, 18),
	(2964, 'Dvaja dôchodcovia vyberajú na domov dôchodcov. Zazvonia pri jedných dverách a vravia:\r\n”Dobrý deň, vyberáme na domov dôchodcov. Nemohli by ste nám niečo dať?”\r\n”Ale samozrejme.” muž vo dverách sa otočí dnu a kričí: ”Mária, kde je tvoja mama?”              ', 287, 3.6, 18),
	(2965, 'Dedko príde k lekárovi a vraví:\r\n”Pán doktor, predpíšte aj mne tú Viagru...”\r\n”Preboha, dedko, načo by ste už vy vo vašom veku potrebovali Viagru?”\r\n”Viete, ja keď sa ráno zobudím, tak sa nemôžem postaviť.”              ', 248, 3.67, 18),
	(2966, '”Nechcete si sadnúť, dedko?”\r\n”Nie, chlapče, ďakujem. Ja idem len jednu zastávku.”\r\n”Len si sadnite, dedko, nie ste v autobuse, ale v parku.”\n', 159, 3.9, 18),
	(2967, 'Žil raz dedko s babkou. Babka išla do dediny nakúpiť a prikázala dedkovi, aby začal pripravovať hus na večeru. Dedko teda vyjde na dvor, chytí hus, ošklbe ju, umyje, šupne na pekáč a strčí do trúby. Potom vyjde na dvor, aby si zapálil cigaru. Keď sa vráti dnu, uprostred kuchyne stojí hus a kričí:\r\n”Dedo, buď mi vráťte perie alebo v tej trúbe zakúrte. Mne je zima!”              ', 411, 3.42, 18),
	(2968, 'Babka ochorie, a tak k nej zavolajú lekára. Keď lekár odíde, babka pootvorí jedno oko a znepokojene sa pýta:\r\n”Kto to bol?”\r\n”Lekár, babka, lekár.” odvetia jej.\r\n”Aha...” upokojí sa babka.\r\n”Hneď sa mi zdalo, že na farára si moc dovoľuje.”              ', 283, 4.06, 18),
	(2969, '”Prečo sa hrabeš v tej žumpe?”\r\n”Spadol mi tam kabát.”\r\n”Kúp si nový.”\r\n”Ale vo vrecku som mal obloženú žemľu.”              ', 151, 3.95, 18),
	(2970, 'Stretnú sa dve babky a jedna nedošla.              ', 53, 2.76, 18),
	(2971, 'Lekár vraví staršej pacientke:\r\n”Tak babka, teraz sa pekne vyzlečieme a ľahneme si sem na lôžko.”\r\n”Joój, synak, je to také nečakané, ale aj si sa mi zapáčil na prvý pohľad.”              ', 211, 4, 18),
	(2972, 'Babka sa trepe do autobusu, ktorý je, ako vždy, natrieskaný na prasknutie.\r\n”Chcete si sadnúť babka?” kričí na ňu zo sedadla drzý teenager.\r\n”Áno, synku.”\r\n”A kam?”              ', 200, 4.11, 18),
	(2973, 'Príde starká do predajne s mäsom a pýta sa predavača :\r\n”Prosím vás, ten mozog je čerstvý?”\r\n”Že váhate,” hovorí predavač, ”ešte ráno lúštil krížovku!”              ', 196, 3.89, 18),
	(2974, 'Príde dedko k lekárovi a sťažuje sa:\r\n”Ľavá noha ma veľmi bolí vždy, keď sa mení počasie.”\r\n”To je starobou.”\r\n”Nie, to nemôže byť starobou.”\r\n”Prečo?”\r\n”Pravá noha je rovnako stará ako ľavá a vôbec ma nebolí.”              ', 266, 3.64, 18),
	(2975, 'Starý bohatý dedko náhle zomrel. Jeho synovia mu pripravujú pohreb. Jim hovorí:\r\n”Vystrojíme mu pohreb za 100 mariek.”\r\nJohn hovorí:\r\n”Celkom by stačil aj za 50.”\r\nDedko sa náhle zdvihne a prevraví:\r\n”Hádam by som na ten cintorín prišiel aj sám.”              ', 286, 3.84, 18),
	(2976, 'Príde vnuk za dedkom a pýta sa:\r\n"Dedko, môžem ísť s tebou?"\r\n"A kam?", pýta sa dedko.\r\n"Ja neviem, ale oco povedal, že zachvíľu pôjdeš..."              ', 165, 3.93, 18),
	(2977, 'Na ulici zastaví prostitútka dedka a hovorí mu:\r\n”Dedko, chceš si so mnou trochu užiť?”\r\nDedko vytiahne 500 korún a podá ich dievčine.\r\n”Dedko, ale veď ešte nič nebolo.”\r\n”Za dôveru, dievča, za dôveru.”              ', 243, 3.5, 18),
	(2978, 'Dedko hovorí vnúčikovi:\r\n”Dám ti sto korún, keď ukradneš otcovi tú modrú tabletku, čo má na nočnom stolíku.”\r\nTak sa aj stalo a na druhý deň dáva dedko vnúčikovi päťsto korún a vnúčik mu hovorí:\r\n”Dedko to ale nie je sto korún.”\r\nDedko na to:\r\n”Stovku máš odo mňa a štyristo máš od babky.”              ', 346, 3.89, 18),
	(2979, '“Pán Novák, tie protézy vám stále neposlali?”\r\n“Nie, poisťovňa mi napísala, že som si mal dávať väčší pozor!”              ', 146, 3.36, 18),
	(2980, 'Pekná mladá žena sa rozhodla, že rýchlo a ľahko príde k peniazom. Našla si osemdesiattri ročného zazobaného dedka a tešila sa, že ho hneď počas prvej noci usúloží k smrti. Aj napriek veľkému vekovému rozdielu svadobný obrad prebehol hladko. V noci si dievčina ľahla do postele a čakala na manžela, ktorý bol v kúpeľni. Keď sa objavil v spálni mal akurát prezervatív na svojom tridsaťcentimetrovom úde a v rukách zátky do uší a štipec na nose. Dievčina, celá vydesená, sa pýta:\r\n- Na čo sú ti tie zátky a štipec?\r\nStarec odpovedá:\r\n- Sú dve veci, ktoré príšerne neznášam. Jačiaca ženská a smrad zo spálenej gumy.              ', 684, 4.22, 18),
	(2981, 'Rodina príde zablahoželať dedovi k narodeninám. Dedo má vo svojich osemdesiatich rokoch dve krásne mladé milenky. Syn sa ho pýta, ako to robí, že i v tomto veku zvláda dve mladé ženy.\r\n- Ja ani neviem. - usmial sa šibalsky dedo a oblízol si obočie.              ', 278, 4.11, 18),
	(2982, 'Starší pár prechádza krajinou svojej mladosti. Vtom babi vykríkne:\r\n- Dedo, urob mi to ako za mlada!\r\nDedo vyskočí, strhne z nej šaty, oprie ju o plot a nastane divoký sex. Keď dedo po dvoch hodinách odpadne babi hovorí:\r\n- Ale takéto vášnivé to za mlada nebolo. \r\nDedo na to:\r\n- Hm, ale to tu tiež ešte nebol elektrický plot.              ', 359, 4.21, 18),
	(2983, 'Dedko si podal inzerát. Odpovedala mu staršia vdova. Zobrali sa a po svadobnej noci sa ho suseda pýta:\r\n- Dedko, čo ste robili s tou ženou, že tak kričala?\r\n- Robil som jej cucfleky.\r\n- A čím? Veď nemáte zuby.\r\n- Naa, kombinačkami!              ', 257, 4.07, 18),
	(2984, 'Stretnú sa dvaja známi:\r\n- Počul som, že ste mali vzrušujúci pohreb.\r\n- To áno, nevieš si predstaviť, koľko nám dalo práce, než sme dedka dostali do rakvy.\r\n- To ste mali takú malú rakvu?\r\n- Malú nie, ale dedko sa bránil.              ', 252, 4.15, 18),
	(2985, 'Babka, fúknite si konečne! \r\nVo vašom veku vám môže byť ukradnuté,\r\nkoľko má tá torta kalórii!              ', 120, 3.64, 18),
	(2986, 'Dedka prešiel valec. Babka nevedela, čo s ním, a tak ho dala pred dvere ako rohožku. Prišla zima, ľudia si do neho utierali nohy, dedko prechladol a zomrel.              ', 176, 3.28, 18),
	(2987, 'Ide babka v minisukni po chodníku a zastaví ju policajt: \r\n- Babka, nemôžete takto v minisukni chodiť po chodníku!!! \r\nBabka: \r\n- A prečo, veď mám pekné nohy!?! \r\nPolicajt: \r\n- To áno, ale trčia vám prsia...              ', 234, 3.85, 18),
	(2988, 'Babka sa chystá s dedkom na prechádzku:\r\n- Dedo, mám si vziať podprsenku?\r\n- Len si vezmi. Vonku je blato.              ', 124, 3.69, 18),
	(2989, 'Ako sa hovorí ľudom, ktorí nejedia mäso?\r\nDôchodci.\n', 57, 3.67, 18),
	(2990, 'Rozprávajú sa dve babky na dedine:\r\n- Tak čo tá vaša vnučka dostala od toho taliana?\r\n- No, hovorila, že syfilis.\r\n- A čo to je?\r\n- No to ja neviem. Ale asi je to väčšie než mercedes.\r\n- A to ako?\r\n- Hovorila, že ak je to fakt pravda, tak sa v tom povezie celá dedina.              ', 296, 4.19, 18),
	(2991, 'Idú babka s dedkom na prechádzku a babka sa pýta:\r\n"Dedko, mám si dať aj podprsenku?"\r\nA dedko odpovie:\r\n"Ale daj si, vonku je blato."              ', 153, 3.88, 18),
	(2992, 'Dedko príde do erotického salónu a zaplatí si ”orálnu” masáž. Počas jej priebehu sa pýta masérky:\r\n”Aký ho mám?”\r\nOna mu hovorí:\r\n”Ako cukrík, čím ho viac cmúľam, tým je menší.”              ', 224, 3.63, 18),
	(2993, '- Bolí ma uško, sťažuje si dievča na lavičke v parku mládencovi. Ten ju na ucho pobozká a pýta sa: - Ešte bolí?\r\n- Ani trošku! Po chvíli ju bolí za krkom. Mladík ju tam pobozká a pýta sa: - Ešte bolí?\r\n- Už nie! Na vedľajšej lavičke sedí starý pán, nakloní sa k mládencovi a pýta sa ho:\r\n - Prepáčte, a hemoroidy liečite tiež?              ', 373, 3.78, 18),
	(2994, '- Odnaučil som babku hrýzť si nechty.\r\n- A ako si to dokázal?\r\n- Schoval som jej zuby!              ', 104, 3.73, 18),
	(2995, 'Príde babička k doktorovi a ten si vraví: \r\n"Babi, máte slabé srdiečko, musíte si oddýchnuť a nesmiete chodiť po schodoch, aby ste si neublížila!" Po určitom čase: \r\n"No vidíte, babička, hneď vyzeráte lepšie, i srdiečko je už v poriadku, po tých schodoch už pomaličky môžete chodiť." \r\n"Jej, pán doktor, ste zlatý. Ani neviete, akú radosť ste mi urobili, že už nemusím liezť po tom zábradlí..."              ', 445, 3.75, 18),
	(2996, 'Nahluchlá babka okopáva počas SNP zemiaky. Ide okolo partizán a slušne pozdraví: \r\n- Smrť fašizmu!\r\nBabka sa zdvihne a odzdraví: \r\n- Aj tebe synku, aj tebe!              ', 179, 3.98, 18),
	(2997, 'Stojí starček pred obchodom s obuvou a mrmle si:\r\n- Je to pravda, že móda sa vracia, pred sedemdesiatimi rokmi som chodil bosý a teraz budem znova.              ', 166, 3.5, 18),
	(2998, 'Dedko vzdychá:\r\n- To je hrozná bolesť, keď idú zuby von!\r\n- Ale dedo, to si už predsa nemôžete pamätať.\r\n- Čoby nie, predvčerom som prehltol protézu!              ', 176, 3.29, 18),
	(2999, 'Babka si vyberá v banke peniaze a slečna pri okienku jej hovorí:\r\n- Pani, ale zo zadnej strany, tam dolu, sa musíte aj podpísať.\r\n- A čo to tam mám napísať, dcérenka moja ?\r\n- No normálne, tak ako sa podpisujete na listy.\r\n- A babka napísala: "Všetkých vás pozdravujem a bozkávam, vaša babka..."              ', 327, 4.01, 18),
	(3000, 'Ide dedko s babkou po lese. Zrazu sa dedko obráti k babke:\r\n- Babka, vyzleč si nohavice.\r\n- Čo, teraz a tu, preskočilo ti?\r\n- Nekecaj a vyzleč ich.\r\nBabka si vyzlečie nohavice. Dedko si ich okamžite oblečie a povie: „Ale sa ochladilo, že?"              ', 264, 3.96, 18),
	(3001, 'Aký je rozdiel medzi švédskym, francúzskym a slovenským dôchodcom? \r\nŠvédsky dôchodca si ráno urobí švédske raňajky, zoberie si tenisovú raketu a ide hrať tenis. Francúzsky dôchodca si ráno urobí francúzske raňajky, zoberie golfové palice a ide hrať golf. Slovenský dôchodca si dá ráno švédske kvapky, zoberie francúzsku barlu a ide do roboty.              ', 388, 3.37, 18),
	(3002, 'Sťažuje sa pán Šín v domove dôchodcov na svoju manželku: \r\n"Nevadí mi, že fajčí moje cigarety, pije moju slivovicu a zoberie mi dôchodok, ale keď si sadne k obedu a smeje sa na mňa mojimi vlastnými zubami, tak to už je priveľa!"              ', 259, 3.64, 18),
	(3003, 'Pýta sa dedko vnučky:\r\n"Anička, chutil ti ten cukrík, čo som ti dal?"\r\n"Áno, chutil."\r\n"No vidíš, a tá potvora Rex ho vypľul."              ', 150, 3.88, 18),
	(3004, 'Babka spadne z 13. poschodia. Postaví sa omráčená a opráši sa. Okolo sa nahrnie hŕba ľudí medzi nimi aj policajt a ten sa babky pýta:\r\n- Babka, čo sa tu stalo?\r\n- Ja ti neviem, synak, ja som teraz prišla.              ', 230, 4.1, 18),
	(3005, 'Deduško sa pýta: \r\n- Prečo ten chlapček dneska tak plače? \r\n- Ále, lezú mu zúbky...\r\n- Jáááj, to poznám, to bolí. \r\n- Prosím vás, ako si to môžete pamätať? \r\n- Pamätám, vlani na Vianoce som ich zhltol.\n', 223, 3.79, 18),
	(3006, 'Inzerát: 63 - ročný, tlstý, smradľavý, neúspešný, nevychovaný muž hľadá ženu opačných vlastností.              ', 128, 3.69, 18),
	(3007, 'Dedko ide o polnoci na záchod. Vráti sa a hovorí babke:\r\n"Babka mi máme na wécku duchov! Keď som prišiel, samé sa zasvietilo a keď som odišiel, samé sa zhaslo."\r\nBabka sa otočí, skoro dostane infarkt a hovorí dedkovi:\r\n"Dedko, ty hlupák, ty si sa zase vysral do chladničky!"              ', 304, 4.14, 18),
	(3008, 'Príde holohlavý sedemdesiatročný dedko\r\nk zrkadlu a spokojne vraví:\r\n"Mám sedemdesiat rokov a ani jeden šedivý vlások na hlave."\n', 138, 3, 18),
	(3009, 'Na dedine zavádzajú elektrický prúd. Elektrikár sa pýta babky:\r\n- Chcete vysoké alebo nízke napätie?\r\n- Radšej vysoké, aby deti nedočiahli!              ', 165, 3.5, 18),
	(3010, 'Starší gentleman opúšťa hotel a vraví recepčnej: \r\n„Poslal som vám posteľ.“ \r\nRecepčná je z toho trochu zmätená, ale je zvyknutá na rôzne rozmary hostí a tak odpovie: \r\n„To nebolo treba, náš hotel má postelí dosť, ale aj tak vám ďakujeme, pane!“\r\n„Plosím, plosím.“              ', 315, 3.9, 18),
	(3011, 'Ide babka po púšti a zakopne o predlžovačku.              ', 62, 2.58, 18),
	(3012, 'Stretnú sa dvaja dedkovia a jeden hovorí:\r\n"Človeče, Ferenc, ja mám hrozné problémy so spaním, nie a nie zaspať."\r\n"Tak to rob ako ja. Ja počítam do troch a potom už super zaspím."\r\n"Fakt? Len do troch?"\r\n"No, niekedy aj do pol štvrtej..."\n', 254, 3.9, 18),
	(3013, 'Babka pošle dedka do pivnice, aby priniesol cesnak a cibuľu.\r\n"Nezabudni! Dve veci!" hovorí babka.\r\nDedko ide do pivnice a za chvíľu prinesie lopatku na smeti.\r\n"Čo si to priniesol? Povedala som jasne: dve veci! Kde máš zmeták?"\n', 238, 2.91, 18),
	(3014, 'Dvaja šestnásťroční sa rozprávajú:\r\n"Dedko mal pravdu, keď mi hovoril, že do toho erotického klubu nemám chodiť, že tam sú veci, ktoré by som nemal vidieť."\r\n"Prosím ťa, a čo si tam videl?"\r\n"Dedka."\n', 219, 3.98, 18),
	(3015, 'Dvaja starí páni sedia na lavičke a prejde okolo nich dobre tvarovaná slečna. Jeden zrazu hovorí:\r\n"Pamätáš, ako sme sa kedysi naháňali za takými dievčatami?"\r\nDruhý niekoľko minút hlboko premýšľa a potom povie:\r\n"Jasné, že si pamätám. Ale nejako si nemôžem spomenúť, prečo."\n', 304, 3.17, 18),
	(3016, 'Ide babka do obchodu. Nevýde jej krok, tak sa vráti domov.              ', 74, 3, 18),
	(3017, 'Dedko si po ošetrení u lekára pochvaľuje:\r\n- Pán doktor, vy máte zázračné ruky. Pár pohybov a tá hrozná bolesť medzi lopatkami je fuč!\r\n- No veru, odvetí doktor. Mali ste prekrútené traky, dedko.              ', 226, 4.19, 18),
	(3018, 'Vnúčik sa chváli babke:\r\nBabka! Babka! My si ideme kúpiť video...\r\nKupujte si, čo chcete, ja to kŕmiť nebudem...              ', 134, 3.59, 18),
	(3019, 'Píše sa rok 1985. Dvaja chlapci idú po Červenom námestí a zrazu sa pred nimi otvorí kanál, z ktorého vystrčí hlavu starý vysušený dedko a pýta sa: “Chlapci, už sa skončila vojna?“ Chlapci si z neho vystrelia: “Nie,ešte nie.“ Dedo si smutne vzdychne: “Do prdele aj s tým Napoleonom.“ a zalezie späť.\n', 332, 4.04, 18),
	(3020, 'Pýta sa vnúčik dedka:\r\n- Dedko, ty nejdeš na to stretnutie partizánov?\r\n- Ale, prosím ťa, čo by som tam robil? Veď ja tých mladých už ani nepoznám..              ', 175, 3.5, 18),
	(3021, 'Pán Roubíček vraví pánu Kohnovi:\r\n- Počujú, vedia o tom, že ich stará chodí s tým šeredným chlapom Silbersteinom?\r\n- Pozrú sa, Roubíček. Či moja stará s niekým chodí, tak to je moja vec. Ak chodí so Silbersteinom, tak to je jej vec a ak je Silberstein šeredný, tak to je jeho vec. Tak o čo vám vlastne ide?\n', 332, 3.33, 18),
	(3022, 'Muž leží na smrteľnej posteli. Už si v duchu odrátava čas do "odchodu".\r\nZrazu zacíti omamnú vôňu pagáčikov. Zozbiera posledné sily a\r\ndoplazí sa do kuchyne a načhuje sa za jedným pagáčikom. Vtom priskočí žena a tresne ho novinami po ruke a kričí:"NECHÁŠ TO!!! TO JE NA KAR"\n', 301, 3.5, 18),
	(3023, 'Starší manželský pár pozerá televízor. Vtom žena hovorí:\r\n- Pozri, drahý, ako sa ten pán milo správa k svojej manželke.\r\n- No áno, ale koľko mu za to platia!              ', 186, 3, 18),
	(3024, 'Babka prechádza cez cestu a policajt na ňu kričí:\r\n- Babka, po prechode by to nešlo?!\r\n- Išlo, išlo, synak, ale nie si môj typ.              ', 149, 3.92, 18),
	(3025, 'Príde babka k doktorovi a vraví mu:\r\n“Pán doktor, mne tmavnú nohy.“\r\n“A umývate ich?“\r\n“A to pomáha?“	\n', 121, 4.19, 18),
	(3026, 'Prišla babka po čase k lekárovi a ten jej hovorí:\r\n“Babka, prečo ste u nás tak dlho neboli?“\r\n“Jáj, bola som chorá, pán doktor, chorá som bola.“\n', 163, 3.42, 18),
	(3027, 'Babička ide k lekárovi na vyšetrenie. Ten ju prehliadne, vyšetrí a povie:\r\n“Babička, vy sa mi nepáčite.“\r\n“Pán doktor, veď ani vy nie ste veľký fešák!“ odvetí babka.\n', 189, 3.69, 18),
	(3028, 'Príde babka do obchodu a pýta si antiviagru. Lekárnička sa čuduje:\r\n"Načo to potrebujete?"\r\n"Ale, pre dedka."\r\n"Veď dedko si tu včera kupoval viagru!"\r\n"Dedko nám do rána umrel a teraz nemôžeme zatvoriť truhlu!"              ', 238, 3.46, 18),
	(3029, 'Starší manželský pár sa vyberie na večeru do reštaurácie. Počas večere zrazu starej pani vystrelí z taniera kus mäsa a skončí na jej bielej blúzke. Stará pani zdvihne oči a pošepky hovorí dedovi:\r\n"Vyzerám ako sviňa."\r\nDedo pokýve hlavou a hovorí:\r\n"A ešte máš aj špinavú blúzku!"              ', 323, 4.06, 18),
	(3030, 'V metre. Staršia pani sedí a nad ňou stojí mládenec, drží sa tyče a zíva, až mu praská v čelustiach, bez toho, aby si dal ruku pred ústa. Pani naňho:\r\n”No, no, aby ste ma neprehltli!”\r\nMladík s pokojným hlasom odpovie:\r\n”Hovädzie nežeriem.”              ', 280, 3.69, 18),
	(3031, 'Vnučka je na prázdninách u svojho nahluchlého dedka. Raz vbehne do domu a nadšene volá:\r\n”Dedo! Predstav si, na záhradke nám vyrástla takáto mrkva a takéto kaleráby!”\r\nDedko odpovie:\r\n”A máš ho rada, dievčatko?”              ', 248, 3, 18),
	(3032, 'Príde babka k doktorovi a sťažuje sa, že je strašne chamtivá. Doktor ju teda pošle na liečenie. Babka sa po týždni vráti z liečenia a ide na kontrolu, na ktorej strašne ďakuje doktorovi:\r\n”Pán doktor, strašne pekne vám ďakujem, ja už nič nepotrebujem, mne nič nechýba...”\r\n”Dobre babka, ale ešte vám predpíšem nejaké lieky.”\r\n”Ale veľa, veľa, veľa...”              ', 407, 3, 18),
	(3033, 'Príde šesťdesiatročný pán k psychiatrovi a vraví:\r\n”Pán doktor, môj o dva roky mladší brat sa vo vani hrá s takou žltou kačičkou.”\r\n”No, to v jeho veku nie je celkom normálne, ale nikomu tým neubližuje, tak mu tú radosť pokojne doprajte.”\r\nA dedo na to:\r\n”Ale, pán doktor, tá kačička je moja!”              ', 343, 4.07, 18),
	(3034, 'Babka posiela dedka do pivnice a vraví mu:\r\n”Dones mi tri veci, počuješ, tri veci - petržlen, mrkvu a cibuľu.”\r\nDedko ide do pivnice, je tam polhodiny, hodinu... o dve hodiny konečne vylezie z pivnice a v rukách má vedro a lopatu. Babka na neho kričí:\r\n”Deko, ty sklerotik jeden! Nevieš, že som ti povedala tri veci, kde máš krompáč?!”              ', 373, 4, 18),
	(3035, 'Sedí mladík v autobuse a pri ňom stojí starenka. Už dosť dlho stojí a rada by si sadla, tak sa mladíka opýta:\r\n”Chlapče, ešte je to ďaleko na konečnú?”\r\n”Ale hej babka, veľmi ďaleko. Ešte sa dosť nastojíte!”	              ', 249, 3.71, 18),
	(3036, 'Vnúčik sa pýta dedka:\r\n”Dedko, bol si cez vojnu partizánom?”\r\n”Nein!”              ', 95, 4, 18),
	(3037, 'Babička vraví ráno svojmu dospievajúcemu vnukovi:\r\n”Vnúčik môj, zase som vo sne lietala a vznášala sa ako na vlnách nad celým mestom.”\r\n”Babi,” hnevá sa vnuk, ”koľkokrát ti mám opakovať, že tvoje tabletky sú v tej druhej škatuľke!”              ', 277, 3.87, 18),
	(3038, 'Sedí kňaz v spovednici a počúva:\r\n- Otče, mám 80 rokov a už som ženatý 50 rokov s mojou ženou. Celý život som jej bol verný, až do včera. Vyspal som sa s 20-ročnými dvojičkami!!! To vám boli telá, miery 90-60-90, krásne oči, vlasy, prsia štvorky akurát do ruky, dole vyholené, to bol grupak...Kňaz, celý červený sa  pýta dedka:\r\n- Kedy ste boli naposledy na spovedi, dedko?\r\n- Ja? Nikdy! Ja som žid.\r\n- A prečo ste mi o tom prišli porozprávať do spovednice?\r\n- Viete, musel som sa niekomu pochváliť...\n', 539, 4, 18),
	(3039, '-Skleróza je celkom fajn vec,\r\nZdôveruje sa dôchodkyňa deťom,\r\n-Nič vás nebolí a každý deň kopa noviniek', 115, 3.26, 18),
	(3040, 'Sedia babka a dedko pri obede a zrazu babka povie:\r\n-Počuj dedo, mňa tak hreje pri srdci...\r\nA dedo na to:\r\n-Ta bodaj by ne, keď máš cicku v polievke...\r\n', 159, 4, 18),
	(3041, 'Príde dedo k doktorovi a sestra mu hovori, pôjdete na 1 poschodie a odovzdáte krv. Potom pôjdete na 2 poschodie a odovzdáte stolicu. Potom pôjdete na 3 poschodie a odovzdáte moč. Potom pôjdete na 4 poschodie odovzdáte spermie. A DEDKO NA TO POVIE: JA VÁM SERIEM NA VYŠETRENIA ZOBERTE SI MOJE TRENKY A TAM NEJDETE VŠETKO :-)))))\r\n', 342, 3.76, 18),
	(3042, 'Dedko sa dopočul, že po chlebe mu stvrdne. Príde teda do obchodu a pýta si tri chleby.\r\n-Tri? Ale však to vám stvrdne, dedoo- hovorí predavačka. \r\n-Kua!! Tak predsa je to pravda! Dajte mi ich päť!', 206, 3.83, 18),
	(3043, '"Dedo uhni!"Povedala babka a dedo uhnil...', 42, 3.39, 18),
	(3044, 'Dedko príde na verejné WC, rozopne si zips na nohaviciach, dá ruky za chrbát, a začne močiť. Moč mu strieka na všetky strany, a chlapík vedľa\r\nneho odskočí, a hovorí mu:\r\n"To si ho neviete chytiť normálne do ruky ?"\r\n"Kto ma raz zradil, tomu ruku nepodám."', 273, 3.73, 18),
	(3045, 'Stretli sa dve babky a jedna neprišla.', 39, 2.88, 18),
	(3046, '- Komu sa žije najlepšie?\r\n- Sklerotikovi.', 44, 2.85, 18),
	(3047, '- Viete čo je najväčšie bláznovstvo?\r\n- Keď dôchodca spláchne svoj dôchodok.', 85, 3.12, 18),
	(3048, 'Ide redaktor na rómsku dedinu a pýta sa jednej babky: "Babke, čo robíte"Babka mu odpovie: "Piču"Redaktor: "Ale babka, ako to rozprávate." A babka mu na to hovorí: "Nešibistuj chlopče, ja piču koláče."', 212, 3.79, 18),
	(3049, 'Dedko s babkou stoja v nebi na nádhernej pláži. Všade okolo nich sú šťastní ľudia, nikto nemá žiadne starosti - proste sú v raji.\r\nVtom dedko vylepí babke obrovskú facku.\r\n- Prečo si to urobil? - pýta sa babka.\r\n- Keby nie tá tvoja sprostá zdravá výživa, už sme tu mohli byť dávno!', 305, 4, 18),
	(3050, 'Príde babka k doktorovi a hovorí mu:\r\n-Pán doktor, čo mám robiť aby mi cicky stali kolmo??\r\nDoktor:- No to je len jedno riešenie babka.\r\nBabka:- A aké??\r\nDoktor:- Choďte po štyroch..', 192, 3.56, 18),
	(3051, 'Beží to za smetiarskym autom a oblizuje sa to, čo je to?\r\nDôchodca-labužník.', 82, 3.33, 18),
	(3052, 'Pozerajú babka a dedko v TV reklamu na krém na omladnutie. Babka hovorí dedkovi: "Choď kúpiť ten krém.Natrú si ho na chleba, zjedia ho a idú spať. Ráno hovorí dedko babke: Ten krém naozaj funguje, v noci som behal na záchod ako 6-ročný.\r\nA babka odpovedá dedkovi: Asi máš pravdu, ja som sa v noci posrala ako 2-ročná.\r\n', 340, 4.02, 18),
	(3053, 'Ide starší opitý pán po prechode pre chodcov a vraví:\r\nTo čo tam hore svieti?\r\nOkoloidúci mu vraví:\r\nMesiac.\r\nAle ktorý? Január, Február alebo Marec?', 160, 3.9, 18),
	(3054, 'Muž zastaví na ulici starčeka a opýta sa ho:\r\nNehnevajte sa, ale hľadám železničnú stanicu.\r\nStarček na to:\r\nNehnevám sa, len hľadajte.', 147, 4.05, 18),
	(3055, 'Čo je to? 2 zuby a 2000 očí?\r\nDomov dôchodcov.', 50, 3.76, 18),
	(3056, 'Ako si spieva Karel Gott, keď si hľadá slipy?\r\nKdepak ty ptáčku hnízdo máš?', 83, 3.97, 18),
	(3057, 'Chvíľku pred začiatkom smútočného obradu sa obradník v sieni otočí ku staručkej vdove a pýta sa: "Koľko bolo vášmu manželovi?""98", odpovie vdova, "bol o dva roky starší ako ja.""Takže vám je teda 96", podotkne obradník.Dáma odpovie: "Hm. To už skoro nemá cenu chodiť domov, však?"', 306, 2.86, 18),
	(3058, 'Dedko si pozerá v časopise rubriku kde sú fotky zosnulých. Vnúčik sa ho pýta:\r\n"No čo dedo, si na facebooku?"', 117, 3.59, 18),
	(3059, 'Pred horiacim domom sa rozprávajú dvaja chlapci:\r\n"Cítim tu karamel."\r\n"Hej, môj dedo mal cukrovku..."', 106, 3.96, 18),
	(3060, 'Babke ukradli bicykel. Okoloidúci sa pýta:"A volali ste políciu???" "Volala." "A čo vám povedali???" "Že oni to neboli."', 126, 3.94, 18),
	(3061, 'Sedí si dedko v parku na lavičke, keď zrazu ide okolo neho partia chlapcov. Hovorí si:\r- Piati s jednou cigaretou a ešte im je do smiechu...', 145, 3.83, 18),
	(3062, 'Ležia babka s dedkom večer na posteli a babka hovorí.\r\n"Dedko, keď sme boli mladí, tak si ma nežne hladkal po chrbátiku."\r\nDedko si teda prisadne bližšie a začne babku hladkať. Babka znova hovorí:\r\n",A keď sme boli mladí, tak sme si treli nošteky ako eskimáci."\r\nDedko teda poslúchne babkinu žiadosť. Babka však o chvíľu opäť hovorí:\r\n"A keď sme boli mladí, tak si mi jemne hrýzol do uška."\r\nDedko sa zrazu postaví a ide preč. Babka za ním kriči:\r\n"Starý, a kam ideš?"\r\nA dedko na to:\r\n"Idem si pre zuby!"', 540, 3.89, 18),
	(3063, 'Príde dcéra domov zo zelovocu, kde mali veľké uhorky a doma rukami znázorňuje mame aké boli: "Mami, v zelovoci mali asi 30 cm dlhé a 8 cm hrúbe uhorky..."\r\nA hluchá babka, ktorá ich vidí kričí: "No, ale či má aj peniaze!"', 237, 3.85, 18),
	(3064, 'Ide dedko s babkou po lese a zrazu dedko hovorí:\r\n- Babka, vyzliekaj tepláky!\r\n- Ale dedko, teraz a tu?\r\n- Nepýtaj sa tak hlúpo a vyzliekaj.\r\nKeď si babka už tepláky vyzlieka, dedko jej ich vytrhne z ruky, oblečie si ich a hovorí:\r\n- Ej, ale sa ochladilo...', 266, 3.95, 18),
	(3065, 'Príde 70-ročný dedko k lekárovi a požaduje:\r- Pán doktor, ja by som potreboval znížiť potenciu.\r- A to už ako, dedko? - čuduje sa doktor.\r- Viete, ja mám sexu plnú hlavu a potreboval by som to posunúť nižšie... ', 228, 3.57, 18),
	(3066, 'Dedko s babkou dobre žili,\rchalúpku si postavili. \rPrdol dedko ani strela,\rchalúpka sa rozletela. \rPrdla babka ešte viac,\rvyleteli na mesiac.\rMesiac bol opitý,\rkopol babku do riti. \rBabka mu to vrátila,\rPodprsenku stratila. ', 230, 2.59, 18),
	(3067, 'Karolko, prečo chceš, aby ti večer sirup proti kašlu dával iba starý otec?\r\nLebo sa mu trasie ruka a vždy polovicu vyleje!', 129, 4.16, 18),
	(3068, '- Bolí ma uško. - sťažuje si dievča na lavičke v parku mladíkovi.\r\nTen ju na ucho pobozká a pýta sa:\r\n- Ešte bolí?\r\n- Ani trošku!\r\nPo chvílke ju bolí za krkom. Mladík ju tam pobozká a pýta sa:\r\n- Ešte bolí?\r\n- Už nie!\r\nNa vedľajšej lavičke sedí starší pán, ktorých ich pozoruje. Po chvíľke sa nakloní k mladíkovi a pýta sa ho:\r\n- Prepáčte, a hemoroidy tiež liečite?', 402, 4.1, 18),
	(3069, 'Babička sa na smrteľnej posteli prihovára vnučke:\r\n"Pretože si moja najmilšia vnučka, chcem ti odkázať svoju farmu, stodolu, obrábacie stroje, stáda zvierat a 28 752 037 dolárov."\r\nVnučka s úžasom pozerá na babku a hovorí jej: "Babička, ty si taká dobrá, to nie je možné, nevedela som, že máš farmu.... a kde je?" \r\nA babička so svojím posledným výdychom zašepká vnučke do ucha: "Na Facebooku."', 426, 4.21, 18),
	(3070, 'Dedko sedí s malým Paľkom na pohovke a spolu pozerajú televízor. Dedko sa pýta vnúčika:\r\n"Paľko, nezdá sa ti, že tí šmolkovia voľajako vyrástli?"\r\n"Ale dedo, veď to je AVATAR!"', 192, 3.75, 18),
