	(3116, 'Poznáte pravidlo DPB?\r\nAk sa do autobusu zmestí N ľudí, tak sa ich tam zemsti aj N+1.', 89, 3.43, 19),
	(3117, 'Aký je rozdiel medzi mäsiarom a športovcom?\r\nMäsiar bohatne od porážky k porážke.', 89, 3.19, 19),
	(3118, '- Je to čierne a visí to na plafóne. Čo je to?\r\n- Neviem.\r\n- Klavír.\r\n- A prečo klavír?\r\n- A teba je čo do toho, ako si ja byt zariadim!', 144, 3.03, 19),
	(3119, 'Viete čo je najväčšia chudoba?\r\nKeď v cigánskej dedine chodia už aj slimaky bez strechy nad hlavou.', 106, 3.49, 19),
	(3120, 'Viete, čo by sa stalo, keby sa Zem otáčala 30x rýchlejšie???\r\nMuži by mali stále výplatu a ženy by vykrvácali.', 120, 3.32, 19),
	(3121, 'Viete prečo sa Microsoft presťahoval na Mesiac?\r\nLebo tam padá Windows šesť krát pomalšie!', 97, 3.29, 19),
