	(3125, 'Je snáď niečo horšie, ako nájsť v jablku červa?\r\nÁno, nájsť tam iba polovičku z neho!', 96, 3.59, 19),
	(3126, 'Aký je rozdiel medzi horolezcom a horolezkyňou ?\r\nHorolezkyňa môže dosiahnuť vrchol už v základnom tábore !', 116, 3.45, 19),
	(3127, '- Vieš kde je Amerika?\r\n- Ďaleko nie, jeden černoch k nám chodí pešo.', 75, 3.37, 19),
