	(3129, 'Viete aký je rozdiel medzi pesimistom a optimistom?\r\nPesimista povie: "Ten už sa nezdvihne ..." \r\nOptimista povie: "Ako krásne visí!"', 137, 3.49, 19),
	(3130, 'Prečo reklamovali Somálci Mazdu 323?\r\nPretože sa ich do nej zmestilo len 322.', 80, 3.38, 19),
