	(4471, 'Ráno po ťažkej pitke sa Jožko sťažka teperí zo stanu a vraví:\r\n- Kua, mňa nejako bolí riť. Tuším som dostal zlatú žilu.\r\nZa ním sa vysmiaty súka jeho kamarát Pali:\r\n- Jóój, môj zlatý! Hemoroidíky - to sú ti riadne potvorky.', 247, 2.79, 20),
	(4472, 'Sedí chlapík - stroskotanec na ostrove a vidí ako k ostrovu pláva ďalší, ktorého postihol rovnaký osud. Keď dopláva okamžite k nemu beží a hovorí mu:\r\n- Aké šťastie, že ste tu, ja už neviem čo mám robiť. Som tu sám so šiestimi ženami a každý deň musím jednu z nich pomilovať. Len nedeľu mám voľnú....\r\nChlapík čo práve doplával sa naňho usmeje a sladko mu odpovie:\r\n- Nedeľôčka nebude ty môj krásnučký....', 452, 3.74, 20),
	(4473, 'Majú homosexuáli svoje dni ako ženy?\r\nÁno a hovoria im hnačka.', 67, 3.29, 20),
