	(4475, '12.4. - piatok\r\n13.4. - piatok\r\n14.4. - piatok\r\n15.4. - piatok\r\n16.4. - piatok\r\n17.4. - piatok\r\n18.4. - piatok. \n\r\nČo je to? Sexuálny denník Robinsona Crusoa.', 161, 3.89, 20),
	(4476, 'V reštaurácii párik novomanželov pri večeri a ona je celá akási ubolená.\r\n- Miláčik, bolí ma rúčka...\r\n- Nechaj, pobozkám a prejde.\r\n- Miláčik, bolí ma noštek..\r\n- Nechaj, pobozkám a prejde.\r\n- Miláčik, bolí ma očko...\r\n- Nechaj, pobozkám a prejde.\r\nNeďaleko sediaci gay to už nevydrží počúvať a opýta sa jemným hláskom:\r\n- Pane, a hemoroidy neliečite?', 387, 4.07, 20),
	(4477, '- Dvaja homosexuáli sú na pláži. Jeden ide do vody a hovorí druhému:\r\n- Poď do vody!\r\n- Nie, nejdem!\r\n- A prečo?\r\n- Lebo rybičky hryzú!\r\n- Ale nehryzú, poď ku mne!\r\nDo vody vojde aj druhý a povie:\r\n- Počuj, mal si pravdu. Nehryzú, ale žužlajú.', 261, 3.12, 20),
	(4478, 'Príde chlap do drogérie a hovorí tichým hláskom: \r\n- Prosím si jednu Niveu.\r\nA predavačka mu hovorí: \r\n- A prečo to hovoríte tak potichu?\r\n- Viete, pretože ja ju nechcem na ruky!', 189, 3.62, 20),
	(4479, 'Pánbožko sa rozhodol urobiť dobrý skutok a navrátil späť na svet troch mŕtvych previnilcov - alkoholika, fajčiara a homosexuála. Ale pred prepustením im povedal, že ak budú páchať tie iste hriechy, tak znova umrú. Tak títo traja už kráčajú po meste a alkoholik zrazu uvidí nedopitú fľašu piva, chytí ho triaška a uteká smerom k fľaši aby sa napil. Ako to urobil hneď aj umrel. Zvyšní dvaja idú ďalej a zrazu uvidia nedopalok. Homosexuál chytil fajčiara za rameno a úpenlivo mu vraví: \r\n- Nezohýňaj sa, lebo umrieme.   ', 559, 3.36, 20),
	(4480, 'Stroskotá loď a na pustom ostrove sa zachráni dvadsať žien a jeden muž. Muž to nemá jednoduché, celý den musí plnit ženám priania a preto je aj poriadne unavený a už nemôže. Keď tu zčistajasna búrka, a na obzore sa prepichne o skalisko iná loď. A na kuse trámu sa blíži ďaľší stroskotanec. Muž! Chlap z ostrova na neho z diaľky volá: \r\n"Hurá! Chlap stroskotal! Konečne nebudem na tie ženské sám.." \r\nStroskotanec odpovedá nežným hlasom:\r\n"Čo je ma po ženských, ale Vy ste mi sympatický!"', 531, 3.69, 20),
	(4481, 'Traja teplí po tom, čo sa naobedovali v mexickej reštaurácii, navštívia svoj obľúbený bar. Sedia popíjajú, zrazu prvý z nich sa uprdne. Celkom potichúčky. Za chvíľku vetry dôjdu aj na druhého. Opäť ticho, tichučko. Až zrazu ten tretí pustí fazulu z tela von a je to veru poriadna rana. Bar stíchne, všetky hlavy sa otočia a teplí takmer unisono:\r\n"Aale čo... Panna!"', 395, 3.46, 20),
	(4482, 'Zomrel homosexuál a keď ho niesli kamaráti do jamy jeden s nich si prdol. Druhý hovorí:\r\n"Že si tu niekto v takejto smutnej chvili môže šepkať slová lásky."', 168, 3.33, 20),
	(4483, 'Po príchode domov vraví homosexuál druhému:\r\n- Počúvaj teraz večer má naháňal jeden chlap v parku!\r\n- A ako to dopadlo?\r\n- Nijako bežal príliš pomaly.', 163, 3.2, 20),
	(4484, 'Smutná duša chlapíka sedí pred bránou pekla. Pristúpi k nej Satan a pýta sa:\r\n- Čo si taky smutný?\r\n- Bodaj by som nebol, keď som tu.\r\n- Ale veď u nás je dobre. Rád piješ? Tak my celé pondelky len pijeme. Fajčíš? Lebo my celé utorky len fajčíme. Rad ješ? Lebo my v stredu len jeme. A čo ženy? Lebo my celý štvrtok len s nimi špásujeme. Si gay?\r\n- Nie.\r\n- Tak piatok sa ti páčiť nebude.', 416, 3.32, 20),
	(4485, 'Policajt príde do baru, ktorý je natretý celý na ružovo. Pýta sa barmana, prečo je ten bar celý ružový a barman odpovedá:\r\n"Počkajte, opýtam sa manželky - Igorko?"', 177, 3.59, 20),
	(4486, 'Príde chlapík k lekárovi a hovorí: \r\n- Pán doktor, ja som asi gay.\r\nDoktor na to: \r\n- A máte košelu od Armaniho?\r\n- Nie, len takúto flanelku.\r\n- A nohavice máte Hugo Boss?\r\n- Nie, iba menčestráky.\r\n- A slipy? Calvin Klein?\r\n- Nie. Obyčajné, úpletové.\r\n- Viete čo? Vy nie ste žiadny gay. Vy ste obyčajný buzerant!', 331, 4.01, 20),
	(4487, 'Ako spoznáte neatraktívneho homosexuála?\r\nMá na zadku pavučinu.', 68, 3.19, 20),
	(4488, 'Buzerant umrel a tak sa vybral do neba.\r\nPri nebeskej bráne mu svätý Peter hovorí:\r\n"Kamarát, ty si tam dole na zemi stváral samé prasačiny, takže môj  milý, ty pôjdeš pekne do pekla."\r\nPo mesiaci sa svätý Peter rozhodol, že pôjde skontrolovať buzeranta do pekla a v prípade, že by sa polepšil, zoberie ho do neba.\r\nZabúcha na pekelnú bránu a vtom mu otvorí Lucifer celý zababušený v kožuchu a s baranicou na hlave.\r\nSvaty Peter sa ho pýta:\r\n"To si nemôžete zakúriť?"\r\nLucifer odvetí:\r\n"To áno, ale skús sa zohnúť pre poleno."', 565, 3.34, 20),
	(4489, 'Dvaja homosexuáli žijúci v spoločnej domácnosti sa strašne povadili. \r\n- Zober si svoje veci a vypadni! - vraví prvý. \r\nDruhý si zbalil svoje veci a odišiel. Samozrejme v tom zhone si dáke veci zabudol, tak sa vrátil na druhý deň k bytu a zazvonil. Otvoria sa dvere a hovorí: \r\n- Prepáč ešte som si zabudol dáke veci...\r\n- Vieš čo ma môžeš s tvojimi vecami...\r\n- NIE, NIE, NIE LEN ŽIADNE UDOBROVANIE!', 425, 3.19, 20),
	(4490, 'Rozprávajú sa dvaja teplí:\r\n- Jožko počul som, že máš novú lásku.\r\n- Áno Miško. To ti je taká veľká láska, že nestíhame ani kakať.', 149, 3.14, 20),
	(4491, 'Ide chlap po pláži a na jednej polke zadku má vytetované Vianoce a na druhej Veľkú noc. Ide za ním buzerant a hovorí:\r\n"Keď budeš mať medzi sviatkami voľno, zavolaj..."', 180, 3.47, 20),
	(4492, 'Príde buzerant ku gynekológovi a vraví:\r\n- Pán doktor, niečo má škriabe v riťke.\r\nDoktor sa mu pozrie do zadku a zbadá tam ružu, buzerant sa otočí a povie:\r\n- To je pre tebe doky.', 191, 3.49, 20),
	(4493, 'Mníška stopárka sa vezie v aute a vraví šoférovi:\r\n- Vy šoféri, vy sa máte. \r\nŠofér ju pomiloval a mníška zasa:\r\n- Vy šoféri, vy sa máte, ale my buzeranti sa musíme prezliekať za mníšky.', 206, 3.89, 20),
	(4494, 'Príde homosexuál do mäsiarstva:\r\n"Prosím si kilo salámy."\r\n"Nakrájať?"\r\n"Debil ty si myslíš, že mám v zadku jukebox."', 128, 3.25, 20),
	(4495, 'Angličan sa vyberie na Safari do Afriky. Ako tak prechádza pralesom, zozadu na neho skočí orangutan a znásilní ho. Vráti sa domov, posťažuje sa priateľovi a je veľmi, veľmi smutný. Priateľ ho utešuje:\r\n- Veď už toľko nezúfaj, zadok sa ti o chvíľu zahojí a nemusíš sa báť, orangutan to zas nikomu nepovie. \r\nOn odpovie smutne:\r\n- Jaj veru nepovie, nepovie, nenapiše, nezavolá.', 403, 3.43, 20),
	(4496, 'Je to teplé a plazí sa to po zemi. Čo to je?\r\nSpitý gay.', 60, 3.21, 20),
	(4497, 'Príde homosexuál domov. Otvorí dvere hovno. Vôjde do kuchyne ďalšie. A takto po celom byte. Vôjde do spálne, a tam leží na posteli jeho priateľ. \r\n"Preboha čo to má znamenať?"\r\n"Nemáš radosť že som to dostal?"', 227, 3.58, 20),
	(4498, 'Ide teplý po ulici a deti na neho vykrikujú:\r\n"Buzerant, buzerant."\r\nTakto sa to opakuje niekoľko dní, až sa teplý naštve a na další deň si so sebou vezme psa. Keď na neho deti začnú pokrikovať Buzerant, povie psovi:\r\n"Šarik, povedz im niečo!" \r\n"Havušky, havušky, hav..."', 290, 3.58, 20),
	(4499, '"Dobrý den, proč se vaší hospodě říká ´U dvou buzerantů´?"\r\n"Nevím, zeptám se manželky. - Frantooo!"', 114, 3.64, 20),
	(4500, 'Ako robí teplý pes?\r\nHavušky havušky hav.', 45, 3.26, 20),
	(4501, 'Pláva George Michael v mori a zrazu sa ozve hlas:\r\n"Daj si dole plavky."\r\nGeorge sa poobzerá dookola, nikoho nevidí, tak pláva ďalej. Zrazu sa znovu ozve hlas:\r\n"Daj si dole plavky."\r\nGeorge sa nahnevá a zakričí:\r\n"Hej,kto si ?"\r\nA z mora sa ozve:\r\n"To som ja, teplý Golfský prúd..."', 294, 3.25, 20),
	(4502, 'Příjde mládenec k lékaři a stydlivým hlasem mu říká.\r\n"Pane doktore já jsem asi homosexuál."\r\nA doktor na to:\r\n"Božínku a já jsem dnes takový neupravený..."', 172, 3.26, 20),
	(4503, 'Vezú sa dvaja chlapi vo výťahu a jeden z nich hovorí: \r\n"Ja by som pomiloval aj muchu!"\r\nDruhý na to reaguje: \r\n"Bźźźźź!"', 131, 3.24, 20),
	(4504, 'Prečo vyhodili buzeranta zo spermobanky?\r\nPretože chlastal v práci.', 70, 3.89, 20),
	(4505, 'Viete koľko má homosexuál spermií?\r\nPlný zadok!', 52, 3.14, 20),
	(4506, 'Zomrie buzerant a ide do neba. V nebi ho privíta Pánbožko a píše mu privítací list. Zrazu fúkne vetrík a listu mu padne, zohne sa poň, buzerant ho vidí zohnutého, nevydrží a urobí mu to. Pánbožko:\r\n"Ešte raz tak ťa pošlem do pekla."\r\nPíše, píše už sa ide iba podpísať, fúkne vetrík a list padne, pánbžko sa zohne, buzerant nevydrží.\r\n"Tak dosť, už si ma nahneval, ideš do pekla."\r\nZa rok príde pán boh na návštevu za buzerantom do pekla a v pekle úplná kosa. Pýta sa čerta-šéfa prečo je tu taká zima.\r\n"Skús sa zohnúť po polienko a uvidíš."', 593, 3.3, 20),
	(4507, 'Prepadnú indiáni koč a náčelník hovorí:\r\n"Ženy zastreliť, mužov znásilniť!"\r\nIndián modré pierko vraví:\r\n"Šéfe, nie náhodou naopak?"\r\nA chlapik v ružovej košieľke mu z koca odpovedáa medovým hlasom: \r\n"Božini, čo sa ty do toho staráš, si snáď náčelník?"', 285, 3.3, 20),
	(4508, 'Dva homosexuálové se šermují svými penisy, jeden se k druhému otočí zadkem a povídá:\r\n"Už mě to nebaví, zapíchni mě!"', 132, 3.03, 20),
	(4509, '- Čau, Fero! Fajčíš?\r\n- Len najlepším kamarátom!', 55, 3.16, 20),
	(4510, 'Príde buzík do mäsiarstva a hovorí mäsiarovi.\r\n"Prosim si tamtú štangličku salámičky."\r\n"Nakrájať?"\r\n"A čo ty pupuško, ty si myslíš, že moja riťka je šporkaska?"', 180, 3.24, 20),
	(4511, 'Rozprávajú sa traja teplí, čím by chceli byť, keby mohli zmeniť svoj život. \r\n"Ja by som chcel byt trávickou.", hovorí prvý.\r\n"Trávičkou, prečo trávičkou?", nechápu ostatní.\r\n"To je jednoduché. Len tak by som si šelestil vo vetríku, svietilo by slniečko, bolo by teplo. Prišli by mladí chlapci, vyzliekli sa skoro donaha, ľahli si na mňa a ja by som ich tak, všade, všadučke hladkal po tom krásnom opálenom tele."\r\n"Juu, to by bolo romantické.", hovoria ostatní dvaja.\r\n"A ja by som chcel byť vodičkou."\r\n"A prečo?"\r\n"Len tak by som si žblnkal, bolo by teplo, leto, prišli by chlapci, povyzliekali sa skoro donaha, poskákali do mňa, plávali by a ja by som ich neprestajne objímal, hladkal ich opálené stehná a ramená a vnikal by som im pod plavky."\r\n"To je vzrušujúce.", hovoria ostatní. \r\n"A ja by som chcel byť sanitkou."\r\n"Sanitkou? Preboha, prečo sanitkou, čo je na tom romanticke, \r\nvzrušujúce?"\r\n"Nič, ale strašne praktické. Predstavte si, že taky chlapík sa zraní, mňa hneď zavolajú, otvoria mi zadoček, celého chlapa tam vsunú a ja budem od radosti robiť uuu-uuu-uuu uuu-uuu-uuu."', 1155, 3.79, 20),
	(4512, 'Chlap bol na vyšetrení a lekár mu oznamuje:\r\n"Je to zlé, váš test na AIDS je pozitívny."\r\n"Pán doktor, a nemôžete mi nejako pomôcť? Dobre zaplatím."\r\n"Bohužial, tu je medicína zatiaľ bezmocná. Vy ste homosexual?"\r\n"Ano."\r\n"Tak potom by som pre vás jeden recept mal. Vezmete kilo neumytých  paradajok, zhnitú rybu, pol druha litra mlieka, pol kila surového mäsa, čo už začína páchnuť, do toho 5 litrov vody, poriadne rozmixovať, nechať 3 hodiny pracovať a potom v priebehu jednej hodiny vypiť."\r\n"Ďakujem, ďakujem, pán doktor, už sa bežím liečiť!"\r\nKeď pacient odišiel, sestrička sa pýta:\r\n"Pán doktor, a prečo ste ho takto, veď ten test na AIDS bol negatívny?"\r\n"Nech si len buzík aspoň raz skúsi, na čo je zadok určený!"', 775, 3.29, 20),
	(4513, 'Pánska jazda, 10 podnapitých chlapov v bare sa začne dohadovať kto má väčší orgán. Nemôžu sa dohodnúť tak nakoniec jeden vyhlási, že bude spravodlivé ak sa postavia ku stolu a každý ho vyloží na stôl. Tak už tam stojí 10 chlapov každý cicinu na stole, keď sa zrazu otvoria dvere na bare a dnu vstúpia dvaja buzeranti. Chvíľu pozerajú a potom jeden z nich povie:\r\n"Aha Jožinko, švédske stoly."', 426, 3.32, 20),
	(4514, 'Dva manželské páry sa zoznámia na dovolenke a tak sa dohodnú, že chcú skúsiť niečo nové. A tak si vymenia partnerov. Po dlhej noci intenzívneho sexu jeden z mužov sa otočí na bok a vzdychne:\r\n- To bola najlepšia noc v živote. Dúfam, že dievčatá sa majú rovnako dobre ako my dvaja.', 302, 3.82, 20),
	(4515, 'Najväčšiemu mazákovi medzi muklami doniesli tabák. Naložil si ho na hlavu a pýtal sa ostatných:\r\n"Vyzerám ako fajka napchatá Taras Buľbom?"\r\nVšetci mu svorne odpovedali, že nie. Tak si chvíľu tabák na hlave naprával a zase sa pýtal. Po tretí raz už väzni pochopili, že majú odpovedať áno. Keď už všetci súhlasili, že vyzerá presne ako fajka napchatá Taras Buľbom, rozopol si rozporok a hovorí:\r\n"Tak. A teraz si každý dva razy potiahne."', 473, 3.36, 20),
	(4516, 'Otázka na rádio Jerevan:\r\n"Mávajú aj buzeranti kritické dni?"\r\n"Áno, ale namiesto \'menštruácia\' ich nazývajú \'hnačka\'."', 130, 3.35, 20),
	(4517, 'Viete čo je najväčšia naivita?\r\nKeď dvaja homosexuáli šetria na kočík.', 79, 3.48, 20),
	(4518, 'Ide Janko polese a počuje krik:\r\n"Jaaanko,Jaaanko!\r\nJanko uteká k horárovi a hovorí mu:\r\n"Pán horár, v lese máme teplého!"\r\nA horár odpovedá:\r\n"Ja viem Jaaanko!"', 171, 3.23, 20),
	(4519, '- Ach, Milanko! Poď sem! Budeme mať bábätko!\r\n- Ale, Ferino! To máš zase iba zápchu!', 91, 3.47, 20),
	(4520, 'Telefonuje jeden buzerant druhému:\r\n"Príď ku mne, bude prdel!"', 65, 3.29, 20),
	(4521, 'Dr. Watson prežil búrlivú noc s prostitútkou. Ráno sa ho prostitútka pýta:\r\n"Ako sa teraz budete môcť pozrieť do očí pani Hudsonovej a sl. Montgomery?"\r\n"Odkiaľ ty môžeš o nich vedieť?"\r\n"Je to prosté, milý Watson.", odpovedá prostitútka suchým hlasom, prefukujúc si náustok od fajky.', 308, 3.13, 20),
	(4522, '- Tak! Konštatujem, že ste z homosexuality definitívne vyliečený - hovorí lekár.\r\n- To je super, pán doktor! Môžem vás za to pobozkať?\r\n- Netreba. Už to je dosť, že mi sedíte na kolenách.', 204, 3.25, 20),
	(4523, 'Zavreli chlapa do basy. Vojde do cely, tam spoluväzeň:\r\n"Tak čo, koľko ti dali?"\r\n"25 rokov."\r\n"Tak to tu budeme spolu ešte 20 rokov. Môžeme si krátiť dlhú chvíľu tým, že sa budeme hrať na otecka a na mamičku. Čo chceš byť, otecko alebo mamička?"\r\nÚbožiak rozmýšľa, čo povedať. Ked povie \'mamička\', tak je jasny. Tak vravi:\r\n"Otecko."\r\n"Výborne! Tak poď sem, otecko, vyfajčiš mamičke."', 418, 3.63, 20),
	(4524, 'Bachar oznámil dvom väzňom, čo sedeli spolu v jednej cele, že dnes dostanú tretieho. Tak sa na neho tešili:\r\n"Tri dni bude robiť manželku mne, tri dni tebe a jeden den bude oddychovať."\r\n"A prečo by mal odpočívať? Nech je dva dni mojou ženou, potom dva dni \r\ntvojou a potom hneď zase mojou."\r\n"Máš pravdu. Aby sme sa nehádali, urobíme mu rozpis."\r\nUrobili rozpis \'služieb\' a vyvesili ho na stenu. Poobede konečne prišiel aj ten tretí spoluväzeň, ale hopla! Ukázalo sa, že je to chlap ako hora a ešte k tomu Gruzínec. Vošiel do cely, poobzeral sa a hovorí:\r\n"Chlapci, odteraz vám budem robiť mamičku. Ale cicík mám len jeden, takže budete musieť sosať na striedačku. Aby ste sa nehádali, môžete isť podľa toho grafikonu, čo visí na stene."', 786, 3.69, 20),
	(4525, 'Nahý homosexuál sa vzrušuje pred zrkadlom a po chvíli hovorí: \r\n"Aaale choď, to som predsa ja!"', 101, 3.26, 20),
	(4526, '- Pán doktor, akú mám nádej, že budem normálny, keď môj otec je homosexuál, dedko je homosexuál, brat je homosexuál ...\r\n- Počkajte, nikto vo vašej rodine nie je na ženy?\r\n- Áno je, moja sestra.', 209, 3.79, 20),
	(4527, 'Dvaja homosexuálny priatelia lúštia krížovku. Zrazu sa začnú veľmi hádať. Okoloidúci chodec sa pristaví a načúva:\r\n"Pohlavný orgán na štyri. Čo to len môže byť?"\r\nKeď zbadali prizerajúceho sa,  opýtali sa ho čo to môže byť.\r\n"No predsa p... ."\r\nNa co jeden z tých dvoch zareagoval:\r\n"No vidíš, ja som ti hovoril, že nie riťť!"', 360, 4.07, 20),
	(4528, 'Chlapi vôjdu do baru, ktorý je celý ružový, a tak sa pýtajú čašníka, prečo je celý bar ružový. Čašník sa zamyslí a kričí na manželku:\r\n- Igorko, miláčik, povedz týmto milým pánom, prečo je náš bar celý ružový.\r\n- Ale, prosím ťa Emilko, nemám čas, mám veľa roboty.', 301, 3.19, 20),
	(4529, 'Mladý lord přijde za svým otcem:\r\n"Papá, chtěl bych se ženit."\r\n"A koho si chceš vzít?"\r\n"Zahradníka."\r\n"Toho komunistu?"', 130, 3.17, 20),
	(4530, 'Stojí nahý buzerant pred zrkadlom a a obzerá si svoje vyšportované telo, keď v tom sa mu začne jeho prirodzenie stoporovať. Buzerant sa zľakne a hovorí:\r\n- No,no,nó, veď to som ja !', 193, 3.04, 20),
	(4531, 'Náčelník dá rozkaz indiánom prepadnúť vlak a vraví:\r\n"Všetky ženy zabiť a chlapov znásilniť."\r\nIndián vraví:\r\n"Náčelník, nepoplietli ste to nejako?"\r\nAle vtom na neho spustí jeden z cestujúcich:\r\n"Hej, ty pupuš, čo sa do toho miešaš? Ty si náčelník, alebo čo???"', 290, 3.18, 20),
	(4532, 'Príde buzerant k doktorovi a hovorí:\r\n- Pán doktor pichá ma v riťke. \r\nDoktor sa mu šprtá v zadku a vytiahne tulipán. \r\n- A toto čo má byť?\r\n- Malá pozornosť pre Vás!', 180, 3.38, 20),
	(4533, 'Pýta sa pocestný hostinského:\r\n"A prečo sa vlastne tejto krčme hovorí \' dvoch buzerantov\'?"\r\n"Ja neviem, spýtam sa manželky. Karoooool..."', 146, 3.17, 20),
	(4534, '"Mami, kúpiš mi zmrzlinu?"\r\n"Moja, za to, že spim s tvojim otcom mi nemusíš hovoriť mama"\r\n"tak ako ťa mam potom volať?"\r\n"normálne predsa, tak ako sa volám, čiže Jožko', 181, 3.2, 20),
	(4535, 'Príde homosexuál ku doktorovi a sťažuje sa, že ho niečo škrabe v zadku. Doktor sa pozrie a hovorí: "Vidím tam iba ružu." A homosexuál mu odpovie: "To je pre vás, pán doktor."', 187, 3.71, 20),
	(4536, 'Okoloidúci sa pýta majiteľa krčmy.\r\n-Prečo sa to tu volá u dvoch buzerantov???\r\nA krčmár na to:\r\n-Počkajte spýtam sa manželky. Karoooooool !!!!', 154, 3.74, 20),
	(4537, 'Leží homosexuál na pláži a má na jednej polovici zadku vytetované Vianoce a na druhej polke Nový rok.\r\nIde okolo druhý homosexuál a pýta sa ho: "Nestretneme sa medzi sviatkami???"', 190, 3.51, 20),
	(4538, 'Ide chlap k doktorovi, aby si nechal urobiť HIV testy, vyplní dotazník a odovzdá krv.\r\nPo čase si príde pre výsledky a pýta sa:\r\n- Tak pán doktor, ako to dopadlo?\r\n- No, mám pre vás zlú správu, testy sú pozitívne.\r\nChlap je v šoku a chce vedieť, či fakt neexistuje nejaká metóda, ako by sa mohol vyliečiť.\r\nDoktor naňho:\r\n- ... a vy tu píšete, že ste homosexuál?!\r\n- No, to som.\r\nDoktor:\r\n- .....hm, tak to sa dalo čakať. Ale mám pre vás pomoc. Vezmite 2 litre mlieka, necháte ho 2 dni na slnku a potom ho vypijete dohromady s 3 skazenými vajciami, pol kilom splesnivenej kapusty a celé to potom zapijete ešte litrom kefíru. Tak to budete robiť 20 dní a s najväčšou pravdepodobnosťou sa zachránite!!!\r\nChlapík poďakuje a nadšene uteká domov urobiť si prvú "liečivú" dávku.\r\nPo jeho odchode sa sestra obráti na doktora:\r\n- Pán doktor, prečo ste mu nepovedali, že testy sú negatívne?\r\n- Aby vedel, na čo sa používa riť, buzerant jeden!!!\r\n', 999, 4.29, 20),
	(4539, 'Homosexuál znásilnil mníšku. Sudca sa ho pýta: - Prečo ste to urobili, keď ste opačne orientovaný? - No viete, keď ona zozadu vyzerala úplne ako Zorro.', 162, 4.19, 20),
	(4540, '- Mami...kúpiš mi zmrzlinu??\r- Nemusíš mi hovoriť mama len preto, že chodím s tvojím ockom ...\r- A ako ti mám teda hovoriť?\r- ..Tak ako všetci .... EMIL. ', 165, 4.04, 20),
	(4551, 'Stretne plešatý hrbatého a sa ho pýta:\r\n”Hej, ty, čo nesieš v tom plecniaku?”\r\n”Tvoj hrebeň!”- odpovedá hrbatý.\n', 129, 3.93, 21),
	(4552, 'V bare:\r\n"Pane, vy ste ožratý ako prasa!"\r\n"Áno, ale mňa to do rána prejde, ale vy ste škaredá ako ropucha a vás to neprejde!"              ', 148, 3.89, 21),
	(4553, 'Fero s Mišom idú v noci po ulici a spievajú. Zastaví ich policajt a vyčíta im:\r\n"Keď už idete tak neskoro v noci domov, tak aspoň nehulákajte."\r\n"A kto vám povedal, že ideme domov?"              ', 207, 3.3, 21),
	(4554, 'Dvaja policajti majú hliadku na diaľnici pri Devínskej Novej Vsi. Zrazu vidia záhoráka ako pred sebou kotúľa veľký sud. Prídu k nemu a pýtajú sa:\r\n"Čo to máte?"\r\n"Viete, doktor chcel, aby som si priniesol týždňový moč."\r\nTak ho pustia. Večer znovu vidia ako záhorák kotúľa sud naspäť.\r\n"A teraz nám to ako vysvetlíte?"\r\n"Doktor v ňom našiel cukor. No nevypálili by ste to?"	              ', 419, 3.53, 21),
	(4555, 'Detektív prelistoval zložku recidivistu, ktorého vypočúval a vraví:\r\n"Hm, celkom pekné čítanie. Krádeže v obchode, vykradnuté autá, verejné pohoršenie, ozbrojená lúpež, obťažovanie, znásilnenie, znásilnenie..."\r\n"No hej, ja viem, dosť dlho mi trvalo, kým som zistil, čo mi ide najlepšie."              ', 328, 3.62, 21),
	(4556, 'Koľko máš rokov, chlapče?\r\n”Doma šesť, v škole sedem a v autobuse štyri.”              ', 99, 3.51, 21),
	(4557, '„Pán hlavný, ten rezeň je hrozne tvrdý.“\r\n„No hej, to musíte hrýzť, to viete, lenivá huba, hotové nešťastie.“              ', 142, 3.04, 21),
	(4558, '”Prepáčte, pane, tento stôl je obsadený!”\r\n”Tak ho odneste a prineste mi druhý!”              ', 107, 4.11, 21),
	(4559, 'Na červenom kabriolete sa preváža holohlavý a chromý. A holohlavý hovorí chromému. "Dupni na to fáro, nech mi veje háro!"              ', 145, 3.04, 21),
	(4560, 'Hosť si objednal polievku. Čašník sa pýta:\r\n”Chcete k nej aj rožok?”\r\n”Áno.”\r\n”He-he-he, rožky už nie sú...”              ', 144, 2.74, 21),
	(4561, 'Čo myslíte, deti. Možno jesť všetky huby, ktoré rastú v lese?\r\n- "Áno, prosím", odpovedá vyvolaný žiak, "ale niektoré iba jedný raz".\n', 148, 3.79, 21),
	(4562, 'Peter hovorí priateľovi:\r\n”Dnes neprídem na pivo, mám skúšobnú jazdu.”\r\n”Máš nové auto?”\r\n”Nie, novú priateľku.”              ', 150, 4.13, 21),
	(4563, 'Príde slepec do obchodu, na vodítku má slepeckého psa. Postaví sa doprostred miestnosti, chytí psa za chvost a roztočí ho nad hlavou. Prekvapený predavač sa ho pýta:\r\n”Čo to robíte?”\r\n”Len sa trochu rozhliadam.” odpovie slepec.              ', 262, 3.7, 21),
	(4564, '”Prečo si nervózny?”\r\n”Lebo chytám ryby.”\r\n”Ale ja som počula, že to upokojuje.”\r\n”To áno, ale nie bez rybárskeho lístka.”              ', 160, 3.52, 21),
	(4565, 'Prišiel veselý muž do reštaurácie, sadol si za stôl a čašník sa ho pýta:\r\n”Vaše prianie?”\r\n”Všetko najlepšie!”              ', 145, 4, 21),
	(4566, 'Slečna! Nechcete sa so mnou zoznámiť?”\r\n”Nie!”\r\n”Ale, slečna! Dajte mi svoj telefón... Aký máte?”\r\n”Nokia.”\r\n”Tak som to nemyslel.Aké máte číslo?”\r\n”Orange.”\r\n”Nie... nie. Cifry čísla sú aké?”\r\n”Arabské...”              ', 266, 3.77, 21),
	(4567, 'Príde chlapík do baru a rozkáže si sedemkrát tequilu a jedno pivo na spláchnutie. Barman naleje sedem panákov a ide čapovať pivo. Za pár sekúnd sa vráti s pivom a panáky nikde, tak vraví:\r\n”Teda, chlape, to ste sa s tým pekne poponáhľal.”\r\nChlapík odvetí:\r\n”No, keby ste mali to, čo ja, tak by ste tiež pili rýchlo.”\r\n”Áno? A čo máte?”\r\nChlapík siahne do vrecka a vraví:\r\n”No, asi šesť korún.”              ', 453, 4.15, 21),
	(4568, 'V temnej uličke prepadne lupič mladú ženu. Kričí:\r\n”Vyzleč sa!”\r\nMladá žena dá zo seba dolu drahý kožuch...\r\n”Všetko dolu! Vyzleč sa do naha!!” nestačí to však lupičovi.\r\n”Keď ja sa hanbím...” odporuje mladá žena.\r\n”Nemáš sa čo hanbiť!” vysvetlí lupič. ”Ja som bývalý lekár!”              ', 340, 3.65, 21),
	(4569, 'Rímsky cisár hovorí gladiátorom:\r\n”Gladiátori, dnes budete mať zápas vo vode. Mužstvo, ktoré vyhrá, dostane slobodu.”\r\n”A ako spoznáme súpera?” pýtajú sa gladiátori.\r\nCisár sa uškrnie a vraví:\r\n”Krokodíly budú mať biele čiapočky.”              ', 279, 4.09, 21),
	(4570, 'Na úrad práce príde hovoriaci zajac. Úradník dlho hľadá, ktoré miesto by sa mu najviac hodilo, nakoniec nájde jedno voľné v cirkuse. Ale zajac hovorí:\r\n”No neviem, či to bude to pravé orechové. Ja som okrem iného dosť dobrý inštalatér.”              ', 274, 3.36, 21),
	(4572, '”Jožko, čo tam gumuješ?”\r\n”Prosím, pán učiteľ, veď ste mi povedali, aby som si tú päťku opravil.”              ', 130, 3.65, 21),
	(4573, 'Pýta sa opička:\r\n”Mamka, prečo sme my opice také škaredé?”\r\nMama opica na to:\r\n”To nič, ale keby si videla toho, čo toto teraz číta.”              ', 165, 3.57, 21),
	(4574, 'Sedí Dežo v krčme predposlednej cenovej skupiny a objedná si guláš a k nemu rožok. Zje a objedná si ďalší a potom ešte raz. Potom pár hodín strávi kecaním so známymi a keď odchádza zakričí čašníkovi:\r\n”Zaplatím. Mal som guláš s rožkom, guláš s rožkom a guláš s rožkom.”\r\n”Tridsať korún a NIE SOM HLUCHÝ!”              ', 363, 3.86, 21),
	(4575, 'Mara vojde do veľkého obchodu so zbraňami. Želá si:\r\n”Prosím si brokovnicu. Mám manžela poľovníka.”\r\n”A povedal vám, akú značku máte kúpiť?”\r\n”Robíte si srandu? Ten ani nevie, že ho chcem zastreliť!”              ', 244, 4.05, 21),
	(4576, 'Osemnásťročná Lenka príde nadránom domov. Vo dverách ju už čaká nahnevaná matka:\r\n”Kde si bola doteraz? Ja keď som bola v tvojom veku...”\r\n”Tak som už mala pol roka.” preruší ju s úsmevom dcéra.               ', 234, 3.65, 21),
	(4577, 'Boli Vianoce a sudca mal dobrú náladu, pýtal sa obžalovaného, prečo je na súde.\r\n”Za predčasné vianočné nákupy.” odpovedal muž.\r\n”To predsa nie je priestupok. Ako skoro ste nakupovali?”\r\n”Dve hodiny pred začiatkom otváracej doby.”              ', 271, 3.89, 21),
	(4578, 'Colná kontrola, colník nájde v kufri auta akýsi sáčok s bielym práškom. Otvorí ho, namočí doňho prst, oblizne a s úsmevom sa pýta vodiča:\r\n”Heroín, heroín?”\r\n”Nie, antrax, antrax.” odpovedá s úsmevom vodič.              ', 248, 3.29, 21),
	(4579, 'Chlapík letí na zájazd malými aerolíniami. Letuška sa ho pýta:\r\n”Chceli by ste večeru?”\r\n”A aký máte výber?”\r\n”Áno alebo nie.”              ', 164, 3.53, 21),
	(4580, 'Na nudistickej pláži sa prechádza nahý chlap a na jednej polovičke zadku má vytetovaný vianočný stromček a na druhej veľkonočnú kraslicu. Príde k nemu teploš a pýta sa:\r\n”Nemáš náhodou medzi sviatkami voľno?”              ', 246, 3.97, 21),
	(4581, 'Psychiater vraví manželovi svojej pacientky:\r\n”Ako sa má vaša pani? Už ju vyliečili z kleptománie?”\r\n”Ešte nie, pán doktor, ale uzdravuje sa, pretože prináša domov už len také veci, ktoré sa môžu zísť.”              ', 243, 3, 21),
	(4582, '”Bol si v nemocnici? Ako sa má Arnold?”\r\n”Nevráti sa tak skoro domov.”\r\n”Rozprával si sa s lekárom?”\r\n”Nie, ale videl som sestričku, ktorá ho ošetruje...”              ', 191, 3.07, 21),
	(4583, '”Pravidelne budete užívať tieto tabletky,” vraví lekár, ”a ešte niečo, najmenej rok nesmiete hrať na klavíri!”\r\nPacientka sľúbila, že radu dodrží a odišla. Po jej odchode sa pýta sestrička:\r\n”Akú súvislosť má jej choroba s hrou na klavíri?”\r\n”Nijakú. Ale ona je moja suseda.”              ', 328, 3.77, 21),
	(4584, 'Hovorí slečna v bare vedľa sediacemu pánovi:\r\n”Prepáčte, pane, prečo ma nepozvete na pohárik? Ja som taká smädná, že ani neviem, s kým budem dnes spať...”\n', 173, 3.92, 21),
	(4585, 'Cigáň stojí pred zrkadlom, obzerá si mužskú ozdobu a hovorí Arane: \r\n"Aranka, kukaj. Keby som mal o 1cm väčší, tak som král!" \r\nArana na neho pozrie a hovorí: \r\n"Dežko a keby si mal o 1cm menší, tak si kráľovná!"              ', 245, 4.08, 21),
	(4586, 'Rýbár sedí na brehu rieky a chytá ryby. Zrazu sa asi dva metre od neho vynorí prefíkaný krokodíl a spýta sa ho:\r\n”Tak čo? Berú, berú?”\r\n”Ale čoby. Dve hodiny a ani ťuk.”\r\n”Tak vieš čo? Kašli na to a poď sa vykúpať!”              ', 261, 3.88, 21),
	(4587, 'Ona: ”Drahý, videl si už pokrčenú stokorunáčku?”\r\nOn: ”Áno.”\r\nOna: ”A pokrčenú tisíckorunáčku?”\r\nOn: ”Áno.”\r\nOna: ”A pokrčeného pol milióna?”\r\nOn: ”Nie, prečo?”\r\nOna: ”Tak sa poď pozrieť do našej garáže.”               ', 269, 3.78, 21),
	(4588, '”Mami, môžem sa ísť kúpať\r\ndo mora?”\r\n”V žiadnom prípade, sú príliš veľké vlny.”\r\n”Ale ocko sa kúpe!”\r\n”Ocko môže, ten má uzavretú vysokú životnú poistku.”              ', 206, 4.19, 21),
	(4589, 'Námorník odchádza od prístavnej prostitútky a tá mu hovorí:\r\n”Práve som ťa nakazila tým najsilnejším hongkongským syfilisom!”\r\nNámorník na to:\r\n”Veď sa ešte ukáže, čí syfilis bol silnejší!”              ', 234, 3.8, 21),
	(4590, 'Fero príde neskoro do práce a ospravedlňuje sa:\r\n”Prepáčte, pán riaditeľ, to malé oneskorenie, ale bolo to z vážnych rodinných dôvodov...”\r\n”Z akých?”\r\n”Pán riaditeľ, dnes som sa stal otcom!”\r\nPrísna tvár riaditeľa sa rozplynie do úsmevu a vraví:\r\n”Gratulujem! A je to chlapec alebo dievča?”\r\n”To budem vedieť až o deväť mesiacov!”              ', 390, 4.14, 21),
	(4591, 'Stojí Fero na trhu a v rukách drží sliepku. Ide okolo Mišo a pýta sa:\r\n”Čo stojí tá sliepka?”\r\n”Desať tisíc.” odpovedá Fero.\r\n”Čo si sa zbláznil? Čo nesie zlaté vajcia, či čo?”\r\n”Ani nenesie, ani som sa nezbláznil. Jednoducho potrebujem desať tisíc.”              ', 301, 3.27, 21),
	(4592, 'Manžel sa predčasne vráti domov zo služobnej cesty. Manželka v spálni prosí milenca, aby vyskočil z okna, lebo ich manžel zabije, keď ich nachytá. Problém však je v tom, že spálňa je na trinástom poschodí. Milenec si pomyslí: ”Nuž, keď musím zomrieť, je to jedno ako”. A vyskočí. Cestou nadol prosí pána Boha:\r\n”Pane Bože, už nikdy nebudem chodiť za inými ženami, už budem svojej žene verný, už nebudem smilníkom. Daj, aby sa mi nič nestalo.”\r\nDopadol na zem a zázrakom sa mu nič nestalo. Vstane, otrepe sa a povie:\r\n”Toľko hovadín za takú krátku chvíľu som už dávno nenatrepal.”              ', 653, 3.31, 21),
	(4593, 'Dve dievčatká sa hrajú v parku. Príde k nim starší ujo a hovorí:\r\n”Ak pôjdete so mnou na lavičku, dám vám každej cukrík.”\r\nDievčatká idú.\r\n”Ak sa mi posadíte do lona, dám vám každej cukrík.”\r\nOny sa posadia.\r\n”Ak mi dovolíte položiť vám ruku na kolienko, dostanete ďalší cukrík.”\r\nOny dovolia.\r\n”Ak mi dovolíte nadvihnúť vám blúzočku, zasa budú cukríky...”\r\n”Ty počuj, radšej poďme preč.” povie jedno dievčatko druhému. ”Kým nás tento tu pomiluje, zomrieme na cukrovku.”              ', 553, 3.98, 21),
	(4594, 'V parku na lavičke sedí pekná slečna. Príde k nej chlapík a hovorí:\r\n- Dobrý deň, slečna, nechceli by ste si náhodou zasúložiť?\r\nSlečna podráždene odpovedá:\r\n- A poriadnu facku ste ešte nedostali?\r\nChlapík sa usmeje a hovorí:\r\n- Dostal, veľakrát. Ale tiež som si veľakrát aj zasúložil.              ', 327, 3.33, 21),
	(4595, 'Cestuje chlap v metre, v hroznej tlačenici a pred ním stojí žena. Vtom chlap hovorí: \r\n- Prepáčte pani, to nie je to, čo si myslíte. Ja mám hrozne malú výplatu a dostávam ju v minciach zabalených do valčeka. A ten som si dal pred cestou do vrecka. \r\nNa ďalšej stanici sa tá žena otočí a hovorí chlapovi:\r\n- Vážený pane, to, že máte malú výplatu, to vám verím. To, že ju dostávate v minciach, to vám tiež verím. Ale to, že vám medzi Václavákom a Karlovým námestím pridali, tak to vám teda nezožeriem!              ', 558, 3.9, 21),
	(4596, 'Ide policajt po ulici a zrazu vidí, ako z blízkeho mrakodrapu skočí chlap, v pohode dopadne na nohy a zmizne vo vchode domu. Po pár sekundách skočí druhý a takto sa to opakuje. O chvíľu to už policajt nevydrží a pýta sa jedného z nich:\r\n- Prosím vás, ako je to možné, že skáčete z takej výšky a nič sa vám nestane?\r\nMuž odpovedá:\r\n- Veď to nič nie je, stačí proste skočiť. Poďte si to vyskúšať.\r\nVylezú teda na strechu a muž hovorí policajtovi:\r\n- No, tak skočte.\r\n- Dobre, ale najprv, nech skočí ten váš kamarát.\r\nChlapík skočí, dopadne perfektne do drepu a máva im hore. \r\n- To je divné, - vraví policajt, - skočte aj vy.\r\nChlap skočí, opäť skvelý dopad. Policajt nechápe, rozbehne sa, skočí, dopadne a rozmláti sa na kašu. Chlapi podídu k nemu a jeden zamyslene vraví tomu druhému:\r\n- Teda, na to, že sme anjeli, sme teda pekné svine...              ', 923, 3.44, 21),
	(4597, 'Na súde:\r\n”Obžalovaný, čo chcete: štyri týždne vo väznici alebo 50 000 korún pokuty?”\r\n”Pán sudca, beriem koruny!”              ', 146, 3, 21),
	(4598, 'Jeden človek má papagája. Už dávno ho učil rozprávať, ale nenaučil sa nič iné ak povedať slovo "samozrejme".\r\nNa koniec sa rozhodol, papagája predať na trhu.\r\nPrišiel jeden zákazník a pýtal:\r\n- Čo stojí váš papagáj?\r\n- Sto korún, odpovedal.\r\n- Prečo taký drahý?\r\n- Lebo je veľmi múdry. Keď to neveríte, tak ho spýtajte!\r\n- Si múdry papagáj?, spýtal sa zákazník.\r\n- Samozrejme, odpovedal papagáj.\r\nMuž sa veľmi potešil a kúpil ho za sto korún.\r\nDoma ho skúsil ďalej učiť roprávať, ale papagáj bol tvrdý jak baran a nič okrem slova "samozrejme" nevypotil.\r\nMuž sa nahneval a hovorí: Len taký blbec ako ja, by si kúpil takéhoto papagája!\r\n- Samozrejme, vykríkol papagáj!              ', 741, 2.71, 21),
	(4599, 'Na Urale zastaví vlak. Cestujúci chvíľu čakajú, vlak nejde, tak sa jeden vykloní z okna a pýta sa:\r\n- Pán výpravca, čo sa deje?\r\n- Meníme lokomotívu.\r\nCestujúci zalezie, čakajú asi pol hodiny, potom sa znovu vykloní a pýta sa:\r\n- Pán výpravca, čo robíte?\r\n- Meníme lokomotívu.\r\nKeď ani o hodinu vlak nejde, nervózny muž sa vykloní a kričí:\r\n- Tak čo, už ste vymenili tú lokomotívu?\r\n- Vymenili, vymenili za vodku.              ', 461, 3.88, 21),
	(4600, 'Dežo kráča z lesa, na pleci jeleň a stretne horára:\r\n- Dežo, čo to máš na pleci?\r\n- Dyk, jeleň. A aký prítulný!              ', 138, 4.08, 21),
	(4601, 'Fero si kúpil mobil a rozhodol sa, že prekvapí manželku. Prišiel domov,napustil si potajme vodu do vane, sadol si do nej a navolil číslo domáceho telefónu. Keď Mara zodvihla slúchadlo, povedal:\r\n- Miláčik, poď mi umyť chrbát.\r\n- Teraz nemôžem, starý je už doma. \r\n- odpovedala potichu Mara.              ', 324, 4.1, 21),
	(4602, 'Klop, klop, niekto klope na dvere.\r\n"Kto je tam?"\r\n"Svedkovia Jehovovi. Chceme sa porozprávať."\r\n„A koľko vás je?"\r\n"Dvaja."\r\n"Tak sa porozprávajte."              ', 170, 4, 21),
	(4603, 'Dvaja po milostnom akte...\r\nOna: Vieš o tom, že mám AIDS?\r\nOn: Viem, ja tiež.\r\nOna: Ale ja som iba žartovala...\r\nOn: Viac nebudeš...\n', 139, 4.19, 21),
	(4604, 'Príde žena k doktorovi na vyšetrenie. Vyzlečie sa a doktor si ju prezerá ako je opálená. Potom jej povie aby sa predklonila. Keď tak urobí, doktor vstane, rozopne si nohavice a zozadu ho tam šupne. Žena vykríkne:\r\n- Pán doktor, čo to robíte?!\r\n- To viete, kam nechodí slnko, tam musí lekár.\n', 309, 4.06, 21),
	(4605, 'Inštruktor učí mladú študentku plávať. Po chvíli sa študentka pýta:\r\n- A to naozaj do mňa natečie voda a utopím sa, ak dáte ten prst von?              ', 165, 4.2, 21),
	(4606, 'Inštruktor v autoškole hovorí budúcej vodičke:\r\n”Slečna, nie že by mi to vadilo, ale hovoril som cúvať, nie cmúľať!”\r\nPo skončení jazdy (už na posteli) hovorí slečna učiteľovi:\r\n”Nie že by mi to vadilo, ale hovorila som lízať, nie zízať!”              ', 284, 3.63, 21),
	(4607, 'Policajti si predvolali Deža na oddelenie:\r\n- Dežo, priznaj sa! Ty si pálil!\r\nDežo nesúhlasne zavrtí hlavou:\r\n- Nepálil.  \r\nPolicajt sa však nedá a pokračuje: \r\n- Ale prístroj máš! \r\nDežo previnilo sklopí oči:\r\n- No, mám. \r\nPolicajt celý rozradostený:\r\n- No, tak vidíš, zaplatíš pokutu 500 korún! \r\nDežo sa zamyslí a po chvíli na stôl položí dve päťstovky. Policajt sa diví: \r\n- A tých ďalších 500 korún je za čo? \r\n- Za znásilnenie. Policajtovi sa hrôzou zježili posledné vlasy: \r\n- Neblázni Dežo, koho si znásilnil? \r\n- Nikoho. Ale prístroj mám!              ', 609, 4.22, 21),
	(4608, '- Haló! Môžem si u vás poistiť dom telefonicky?\r\n- Žiaľ, to musíte osobne.\r\n- Tak to radšej zavolám hasičov...              ', 135, 4.21, 21),
	(4609, '- Koľko hodín denne spíte?\r\n- Asi tak dve.\r\n- A stačí vám to?\r\n- Samozrejme, v noci spím osem.              ', 115, 4.16, 21),
	(4610, '- Povedz, ty si vraj začal denne šesť hodín cvičiť na klavír?\r\n- Človek musí vedieť, čo chce dosiahnuť.\r\n- A čo chceš dosiahnuť ty?\r\n- Susedný byt!              ', 177, 4, 21),
	(4611, '- Tak čo, pán Novák, aká bola dovolenka pri mori?\r\n- Horor! Celé dva týždne v kuse pršalo.\r\n- Ako to? Veď vidím, že ste opálený.\r\n- To nie je bronz, ale hrdza!              ', 186, 3.75, 21),
	(4612, '- Pán kapitán, naša loď sa potápa.\r\n- Dobre, kde je najbližšia zem?\r\n- Asi dva kilometre.\r\n- Ktorým smerom?\r\n- Zvislo dolu!              ', 145, 3.84, 21),
	(4613, '- Oco potešil by si sa, keby som ti daroval k narodeninám kravatu?\r\n- No... viac by ma potešilo dobré vysvedčenie.\r\n- Neskoro. Už som kúpil kravatu.              ', 169, 3.56, 21),
	(4614, '- Miláčik, kým sa spolu zosobášime, musíš mi ešte sľúbiť, že ma budeš bozkávať na miestach, kde ma ešte nikto predtým nebozkával.\r\n- Dobre láska moja, ktoré sú to?\r\n- Na  Kanárskych ostrovoch, na Seychelloch a na Mauricii....\n', 248, 4.19, 21),
	(4615, 'Škót a Angličan idú na svadbu. Angličan hovorí: \r\n- Ja nesiem novomanželom čajovú súpravu pre 12 ľudí. \r\n- A ja, - vyťahuje sa Škót, - sitko pre osemdesiat ľudí!              ', 192, 3.67, 21),
	(4616, 'Starý lord príde večer domov, sluha mu pomáha z kabátu a polohlasom vraví: \r\n- Tak čo, ty starý krokodýl, zase si bol v bare nasávať a pozerať po pekných dievčatách, čo?\r\nLord odpovie: \r\n- Vôbec nie, James. Dnes som si bol kúpiť naslúchací strojček.              ', 285, 4.01, 21),
	(4617, 'Dvaja policajti robili obchôdzku a vidia, že pri lese je zaparkované auto na nesprávnom mieste. Podišli k autu ale vodiča tam nebolo. Nuž poobzerali sa a vidia, že neďaleko cesty za kríčkom čupí chlapík a tlačí. \r\n- Hej, občan a máte papiere? použil úradný tón jeden z policajtov.\r\n- Nemám, ale mne stačia lopúchy!              ', 353, 4.17, 21),
	(4618, 'Nápis na náhrobnom kameni:\r\n„ Nesmúťte, neplačte, ja som vás neopustil, ja som vás len predbehol."\n', 108, 3.6, 21),
	(4619, '"Dôverne vám prezradím, že idem načierno," zdôveril sa nenápadne v električke muž inému - vedľa sediacemu. \r\n"Dôvera za dôveru," povie oslovený,  "ja som revízor!"\n', 179, 4.04, 21),
	(4620, 'Sudca vojde do sály, buchne kladivkom a vraví: \r\n"Skôr, ako začne pojednávanie, musím vám oznámiť jednu vec. Obhájca mi zaplatil 300.000, aby som rozhodol v jeho prospech. Žalujúca strana mi zaplatila 200.000, aby som rozhodol v ich prospech. Aby som učinil proces spravodlivým, vraciam obhajobe 100.000."              ', 333, 3.88, 21),
	(4621, 'Indiáni prepadli dostavník, náčelník velí: \r\n"Všetky ženy povraždiť a mužov znásilniť!" \r\nJeden z komančov sa ozve: \r\n"A nie naopak?" \r\nJeden z prepadnutých v ružovej košieľke vraví medovým hlasom:\r\n"Jejda, a čo ty do toho kecáš, náčelník to povedal dosť zrozumiteľne, nie?"\n', 303, 4.19, 21),
	(4622, 'Anglický lord sa po stroskotaní lode ocitol na pustom ostrove. Keď ho po rokoch objavila loď, kapitán sa spýtal: \r\n"Sir, a prečo ste si postavili tri chatrče?" \r\n"V jednej bývam, v druhej je klub, ktorý navštevujem a v tretej je klub, ktorý ignorujem."              ', 278, 4, 21),
	(4623, 'Ľudia sa dajú všeobecne rozdeliť do dvoch skupín. \r\nDo prvej a do druhej.              ', 92, 3.63, 21),
	(4624, '"Koľko máš rokov, maličká?"\r\n"Teraz mám len päť, ale mamička mi povedala, že keď budem pravidelne piť rybací tuk, tak o rok už budem mať až šesť!"              ', 178, 4.06, 21),
	(4625, '"Pozri sa na toho chlapca, aké má krivé nohy!"\r\n„No čo, to je môj syn!"\r\n„Ej, ale mu pristanú, fešákovi!"              ', 131, 3.57, 21),
	(4626, 'Traja blázni stoja na skale a pod nimi je 300 metrová priepasť. Prvý skočí dolu a spieva: \r\n- Poďme spolu lietať... \r\nPotom skočí aj druhý a spieva ďalej: \r\n- Pozri ja už letím... \r\nKeď ich ten tretí vidí, zaspieva: \r\n- Keď sú dvaja šťastní, nechýba im tretí... a odíde preč.              ', 315, 3.82, 21),
	(4627, 'Sudca:\r\n- Museli ste predsa zbadať, že ste vzali cudziu peňaženku!\r\n- Možno, ale peniaze sa mi videli akési známe.\n', 122, 4.22, 21),
	(4628, 'Pán Novák strávil peknú dovolenku v zahraničí a vracia sa vo výbornej nálade domov. Pri východe z letiska vykonáva colník námatkovú kontrolu a spýta sa pána Nováka:\r\n"Koňak, whisky, cigarety?"\r\n"Nie, ďakujem, ste veľmi láskavý, ale šálkou kávy by som nepohrdol."              ', 300, 3.75, 21),
	(4629, 'Plazia sa dvaja po púšti a jeden vraví:\r\n- Zaškríp zubami, možno nám prebehne mráz po chrbte.              ', 115, 4.06, 21),
	(4630, 'Do obchodu príde korpulentná pani a vraví predavačovi:\r\n- Rada by som videla nejaké plavky, čo by mi pristali.\r\n- Aj ja - odvetí predavač.              ', 160, 3.63, 21),
	(4631, 'Príde Ír do baru, vypýta si 5 panákov a naraz ich vypije. Barman sa ho pýta:\r\n"Prečo si ich nedáte postupne?"\r\n"Nás je päť kamošov a sme zvyknutí sa tu schádzať. Tí štyria sú ďaleko, tak pijem za nich."\r\nChodí tam ďalej až si raz dá miesto päť panákov štyroch. "Čo sa stalo? Umrel vám kamoš?"\r\n"Nie, ja som autom."\n', 344, 3.79, 21),
	(4632, 'Jeden taký starší suchár sedí v motoreste, do ktorého zapadnú traja motorkári. Majú roztopašnú náladu, tak prvý zahasí svoju cigaru v chlapíkovom koláči, druhý mu napľuje do kávy a tretí mu obráti tácku hore nohami. Chlapík sa bez slova zdvihne a opustí motorest. Prvý motorkár vraví servírke:\r\n„Pch, nič moc, ten chlap, že?"\r\nA servírka sa usmeje:\r\n„No, a šofér je tiež mizerný. Práve pri cúvaní rozmačkal svojim kamiónom tri motorky."              ', 495, 4.17, 21),
	(4633, 'Policajt šoférovi:\r\n- Fúkajte!\r\n- A kde vás bolí?              ', 68, 3, 21),
	(4634, 'V obchode s divinou si pani pýta bažanta:\r\n- Ale nech v ňom nie su broky!\r\n- Milostivá pani! Bažanta, ktorý sa uchechtal k smrti, žiaľ nemáme!              ', 165, 4.17, 21),
	(4635, '"Cyril, požičaj mi desať korún."\r\n"Nemám, ale ak chceš, poďme do krčmy a ja za teba zostanem dlžný."\n', 111, 3.84, 21),
	(4636, 'Dvaja nenápadní chlapi vezú na bicykli vrece piesku. Zastaví ich policajt a pýta sa:\r\n"Čo máte v tom vreci?"\r\n"Piesok!"\r\nPolicajt ich skontroluje a odíde. Keď sa vzdiali, jeden chlapík hovorí druhému:\r\n"Vidíš? Takto sa kradnú bicykle!"\n', 251, 4.21, 21),
	(4637, '"Chaim, nemohol by si mi požičať stovku?"\r\n"Je mi ľúto, nemám pri sebe peniaze."\r\n"A čo doma?"\r\n"Ďakujem, všetci zdraví."\n', 132, 3.7, 21),
	(4638, 'Pýta sa študent rabína:\r\n"Smie sa pri štúdiu Talmudu fajčiť?"\r\n"Nie, nesmie!"\r\nŠtudent sklamane odíde, ale kamarát ho utešuje:\r\n"Spýtal si sa zle, to musíš inak: Smie sa pri fajčení študovať Talmud?"\r\n"Áno, smie..."\n', 235, 3.67, 21),
	(4639, 'Zomrel boháč. Notár číta poslednú vôľu:\r\n"A Karlovi, ktorému som sľúbil, že si naň spomeniem v záveti, posielam srdečný pozdrav."\n', 146, 4.13, 21),
	(4640, 'Sudca k obžalovanému:\r\n"Chcete uviesť nejaké poľahčujúce okolnosti?"\r\n"Áno, chcel by som povedať, že už som bol trikrát trestaný a vôbec to nepomohlo!"\n', 166, 3.58, 21),
	(4641, '"A to si predstavte, že ja teraz nemám žiadne peniaze. Ja som napríklad minulý týždeň musel predať kachle, aby som mohol zaplatiť uhlie!"\n', 148, 2.7, 21),
	(4642, 'Bavia sa dvaja riaditelia:\r\n"Viete kolega, že vo vašom závode pracuje môj vnuk?"\r\n"Áno, viem, je to veľmi vtipný človek. Práve včera si bral voľno na váš pohreb."\n', 176, 3.25, 21),
	(4643, 'Po oslave ráno manželka upratuje a hovorí manželovi:\r\n"To sú dnes ľudia. Predstav si, zmizli dva poháre!"\r\n"Ktoré?"\r\n"No tie s tým nápisom Hotel International."\n', 171, 2.8, 21),
	(4644, 'Stretne múdry blbého a hovorí:\r\n"Budeme hádať, keď ty neuhádneš, dáš mi päť korún, keď ja, dám ti stovku."\r\n"Má to 4 nohy a stojí to pri stole?" pýta sa múdry.\r\n"Neviem, tu máš päť korún."\r\nNa to ten blbý:\r\n"Má to 4 nohy a keď to vstane, má to 3 nohy?"\r\n"To neviem, tu máš stovku - čo to je?"\r\n"Neviem, tu máš päť korún."\n', 358, 3.73, 21),
	(4645, 'Pracovník uhoľných baní ide cez vrátnicu s fúrikom plným uhlia. Vidí ho vrátnik a pýta sa:\r\n"Čo to tam vezieš?"\r\n"Žrádlo pre králikov!" \r\n"Ty dávaš králikom uhlie? Veď to nebudú žrať!"\r\n"To je ich problém, keď to nezjedia, tak ja to budem musieť zase nahádzať do pece."\n', 297, 3.36, 21),
	(4646, 'Za komunizmu prídu redaktori zistiť k pracovníčke v továrni na šijacie stroje ako žije.\r\n"Pani, veď vy nemáte doma šijací stroj!" hovoria jej. \r\n"To ste si za tú dobu nemohli nakradnúť súčiastky a doma si ho poskladať?"\r\n"Veď som to tak aj urobila, ale jak skladám tak skladám, furt mi vyjde guľomet." \n', 324, 4.11, 21),
	(4647, 'V malom obchode bola na dverách výrazná cedula \'Pozor, pes!\'\r\nChlapík, prišiel vliezol opatrne dovnútra a pozerá, pri pulte leží starý baset a spí. \r\nPýta sa predavača:\r\n"No, nevyzerá, že by mohol byť nejako nebezpečný. Môžete mi povedať, prečo ste tam dal tú cedulu?"\r\n"Keď tam nebola, ľudia oňho zakopávali."\n', 338, 4.07, 21),
	(4648, 'Sedí chlapík v krčme IV. cenovej skupiny, objedná si guláš a rohlík. Zje a objedná si ďalší. A ešte raz repete. Potom sa ešte asi hodinku rozpráva so známym. Keď odchádza, hovorí čašníkovi:\r\n"Tak mal som guláš s rohlíkom, guláš s rohlíkom, guláš s rohlíkom."\r\n"Pätnásť päťdesiat, a NIE SOM HLUCHÝ!"\n', 335, 3.4, 21),
	(4649, 'Pani nadáva predavačovi:\r\n"Čo ste mi to predal? To nie je žiadny prášok proti molám, veď oni si na ňom pochutnávajú."\r\n"No, žerú prášok a šatom dajú pokoj."\n', 174, 3.75, 21),
	(4650, 'Čašník počíta útratu:\r\n"Guláš 35.20, dva rohlíky 3.40, keď to pôjde 17.30..."\r\n"Prosím vás, čo bolo to posledné?"\r\n"Tak to nejde, dva rohlíky..."\n', 162, 3.87, 21),
	(4651, 'Predavačka plešatému:\r\n"Fakt neviem, aký šampón by som vám mohla odporučiť, snáď jedine leštidlo na parkety."\n', 122, 3.5, 21),
	(4652, 'Príde zákazník do obchodu:\r\n"Prosím vás, máte cigary?"\r\n"Iste, v tamtom regáli."\r\nZákazník sa siahol do regálu, vytiahol cigaru a zapaľovač, no predavač naň volá:\r\n"Pane, tu sa nesmie fajčiť."\r\n"Prečo nie, keď predávate cigary?"\r\n"Predávame aj toaletný papier!"\n', 284, 3.2, 21),
	(4653, 'Mladý biznismen prvý deň zahajuje činnosť. Zrazu ktosi zaklope a vojde. Mladík chce vyzerať skúsene, tak vezme do ruky telefón a začne predstierať jednanie. \r\nHádže veľké čísla a termíny. Keď akože skončí, povie:\r\n"Dobrý deň, pane. Môžem pre vás niečo urobiť?"\r\n"Jasné. Keď dovolíte, zapojím telefón."\n', 336, 3.94, 21),
	(4654, 'Do autobusu nastupujú ľudia a kupujú lístky, posledný\r\nnastúpi chlap v kovbojskom odeve. Vytiahne dva kolty a hovorí:\r\n"Johny dnes neplatí."\r\nVodič sa naň pozrie:\r\n"Jasné, dnes neplatíš."\r\nDruhý deň sa to opakuje. Tretí deň to vodiča už naštve:\r\n"Akože dnes Johny zas neplatí?"\r\nJohny siahne do vrecka:\r\n"Johny má preukážku."\n', 351, 4.17, 21),
	(4655, 'Hovorí námorník v spoločnosti:\r\n"Raz som na jednom ostrove išiel po pláži a vidím tam sedieť takého divného vtáka.\r\nTen vták tam znášal kockaté vajcia a hovoril!"\r\n"Oh," zahučí to v spoločnosti, a jedna dáma sa spýta:\r\n"A čo hovoril ten vták?"\r\n"No, čo asi. Au!"\n', 287, 3.67, 21),
	(4656, 'Do fotoshopu príde zákazník a hovorí: \r\n- Chcel by som si z tohto filmu dať spraviť fotky.\r\nMajiteľ sa pýta: \r\n- 9x13? \r\n- 117, prečo sa pýtate?  \n', 157, 3.62, 21),
	(4657, 'Stoja vedľa seba 3 obchody. Majiteľ ľavého vyvesil cedulu: NAJNIŽŠIE CENY, majiteľ pravého cedulu: NAJKVALITNEJŠÍ TOVAR, majiteľ stredného cedulu: VCHOD TU.                ', 184, 4.05, 21),
	(4658, 'Príde dievčatko do cukrárne: \r\n-Prosila by som si jednu čokoládovú figúrku za desať korún. \r\n-A chceš chlapečka alebo dievčatko? Pýta sa predavačka.\r\n-Chlapečka. Na tom je o kúsok čokolády viac. \n', 214, 2.88, 21),
	(4659, 'Blázon krič na druhého:\r\n“Ešte raz mi povieš, že som psychopat, tak ťa zabijem!“\n', 92, 2.5, 21),
	(4660, 'Starší muž príde k čarodejnici a spýta sa, či by ho dokázala oslobodiť od kliatby, ktorá ho sužuje už 40 rokov. Čarodejnica odpovie:\r\n- Možno, ale musela by som poznať presné znenie slov, ktorými bola táto kliatba na vás uvrhnutá.\r\n- To vám môžem zopakovať hneď: “A pretože ste splnili všetky podmienky stanovené zákonom, prehlasujem vaše manželstvo za právoplatne uzavreté.\n', 410, 3.86, 21),
	(4661, 'Horí chalupa a v nej ležia traja flegmatici. Prvý hovorí:\r\n- Chlapi, horí.\r\nDruhý na to:\r\n- Počkáme, prinajhoršom nás vynesú.\r\nA tretí vraví:\r\n- Do kelu, spite. Vy toho nakecáte!\n', 193, 4, 21),
	(4662, 'Vlak vojde do tunela a odrazu sa ozve ženský výkrik:\r\nTu sa ktosi miluje... Bože... dokonca so mnou!\n', 105, 4.09, 21),
	(4663, '\r\nMalý Janko zbadá niekoho liezť oknom do kúpeľne a pýta sa:\r\n- Kto si?\r\n- Som čierny Azurit!\r\n- A budeš tu, keď sa vrátim?\r\n- Čo ti šibe? Beriem práčku a padám!              ', 190, 3.74, 21),
	(4664, 'Dvaja advokáti sa  vybrali večer do luxusnej reštaurácie. Objednali si každý nealko, vytiahli vlastné sendviče a pustili sa do jedla. Pribehla servírka a upozornila ich:\r\n- Páni, tu nesmiete konzumovať vlastné potraviny!!\r\nAdvokáti sa pozreli na seba, vymenili si sendviče a jedli ďalej.              ', 316, 3.75, 21),
	(4665, 'Jeden chlapík - mäsiar - zarobil veľa peňazí na mäse. Mal však veľmi hlúpeho syna. Nechceli ho vziať na žiadnu školu, tak sa rozhodol, že ho vyučí za mäsiara. Vraví mu:\r\n- Tento stroj je najmodernejší výrobok. Strčíš doňho vola a von vyjde párok. Vidíš?\r\n- Ty, ocko - ozval sa syn - a naopak by to nešlo?\r\n- Ako naopak?\r\n- No, že by si tam strčil párok a vyliezol by vôl.\r\nMäsiar sa poškriabal na brade a vraví:\r\n- Chlapče, taká mašina bola na svete len jedna. Tvoja matka.               ', 526, 4.24, 21),
	(4666, 'Sedliak sa dozvedel, že je nevyliečiteľne chorý a onedlho umrie. Tak vraví lekárovi:\r\n- Pán doktor, mám jedno želanie. Napíšte mi potom, že som umrel na aids.\r\n- Ale prečo, veď máte predsa takú peknú rakovinu.\r\n- No, ja mám na to tri dôvody: po prvé - takú chorobu u nás na dedine ešte nikto nemal, po druhé - ten, čo mi chodil za ženou zomrie od strachu a po tretie - nikto sa jej do smrti nedotkne.              ', 440, 2.8, 21),
	(4667, 'Chlapík príde do drogérie a vypýta si balíček kondómov. Keď ich dostane, začne sa strašne smiať a odíde. Toto sa opakuje niekoľko dní. Šéf drogérie si hovorí, že je to divné, a tak povie pomocníkovi, aby ho sledoval. O pol hodiny sa pomocník vráti a šéf sa hneď pýta:\r\n- Tak čo, sledoval si ho?\r\n- Áno, pane.\r\n- A kam išiel?\r\n- K vášmu domu.		              ', 389, 3.56, 21),
	(4668, 'V mäsiarstve za pultom visí veľké zarámované zrkadlo. Zákazník sa pýta mäsiara, prečo ho tam zavesil.\r\n- Pane, videli ste už ženu, ktorá, keď má pred sebou zrkadlo, aby sa pozerala na váhu? - odpovedá mäsiar.              ', 241, 3.56, 21),
	(4669, 'Zaklope turista na dvere domu, otvorí mu babka a pýta sa:\r\n- Čo si praješ, synak?\r\n- Dobrý deň, babka. Nemáte trochu pitnej vody? Som taký hladný, že by som tu prespal.              ', 192, 2.8, 21),
	(4670, 'Traja homosexuáli sa rozprávajú o tom, čím by chceli byť. Prvý hovorí:\r\n- Ja by som chcel byť vetrík, všetkých by som poovieval...\r\nDruhý vraví:\r\n- Ja by som chcel byť vodička, ľudia by si na mňa ľahli a ja by som na nich šplechotal a šplechotal...\r\nA tretí vraví:\r\n- Ja by som chcel byť sanitkou. Oni by mi ho jednoducho zasunuli do zadočku a ja by som robil len uuu-uuu, uuu-uuu...              ', 422, 3.45, 21),
	(4671, 'Mišo príde na parkovisko a zbadá, že do jeho auta ktosi nabúral. Za stieračom však nájde odkaz. Číta: "Keď toto píšem, sleduje ma asi tucet ľudí. Myslia si, že sem píšem svoje meno, telefón a číslo poistky. Ale nepíšem..."              ', 259, 4.07, 21),
	(4672, 'Samota v lese. O polnoci zrazu niekto zabúcha na dvere a pýta sa:\r\n- Potrebujete drevo?\r\nZvnútra sa ozve podráždený hlas:\r\n- Nepotrebujem!\r\nRáno sa majiteľ samoty zobudí a dreva nikde.              ', 207, 3.82, 21),
	(4673, 'Išiel dedo na bicykli, prepadli ho zbojníci a hovoria mu:\r\n"Dedo, daj dušu alebo peniaze."\r\n"A ktorú dušu? Prednú či zadnú?"              ', 146, 2.86, 21),
	(4674, 'Vybrala sa babka s puškou do lesa a stretla mladého muža. Keď muž uvidel pušku začal kričať:\r\n"Nestrieľajte, babka, ja vás nechcem znásilniť!"\r\nA babka na to:\r\n"Ja viem, ale budeš musieť!"	              ', 218, 3.17, 21),
	(4675, 'Do autobusu nastúpi revízor a pýta si od jedného cestujúceho lístok:\r\n"Cestovný lístok si prosím."\r\n"Ja lístky nepredávam, skúste automat na zástavke."              ', 178, 3.92, 21),
	(4676, 'Pár mesiacov po svadbe. Manžel prišiel domov a manželky nikde. Tak po nej začali spolu s priateľmi hneď usilovne pátrať, ale bohužiaľ bezúspešne. O dva dni prišiel manžel domov a našiel ženu v kuchyni, a tak sa jej hneď začal pýtať, kde a prečo bola. Manželka vraví:\r\n"Predstav si, uniesli ma nejakí štyria nespratníci, aby sa mohli so mnou celý týždeň milovať."\r\n"Vravíš týždeň, ale bola si preč iba dva dni, nie?"\r\n"Veď ja som si prišla vziať len niečo na jedenie."	              ', 524, 4, 21),
	(4677, 'Chlapík sa vracia zo služobnej cesty. V spálni nahá manželka, dvere na skrini pootvorené. Chlap zoberie kladivo, otvorí dvere a tam nahý chlapík.\r\n"Ha, sviňa, čo tu robíš?!"\r\n"Ja som z dezinfekčného oddelenia a pani manželka si ma objednala, aby som u vás vykynožil mole."\r\n"Tak a prečo si potom holý?!" reve manžel.\r\nChlapík sa prekvapene pozrie na seba a s nefalšovaným údivom hovorí:\r\n"To sú ale beštie nenažrané, tie mole. Kedy to stihli???"              ', 489, 3.65, 21),
	(4678, 'Policajt zastaví vodiča a vraví :\r\n"Tu je povolená rýchlosť 40 km/hod a vy ste išli osemdesiatkou!"\r\n"Kam ste sa tak ponáhľali, pán vodič!?"\r\n"Tu pre vás som 2000 korún viezol..."              ', 206, 4, 21),
	(4679, 'Lietadlo nad Atlantikom stráca výšku, motory vynechávajú, kapitán prikáže vyhodiť všetky batožiny. Na chvíľu to pomôže, ale o chvíľu sa morská hladina opäť nebezpečne blíži. Pasažieri po sebe nervózne pokukujú, niekto sa musí obetovať pre záchranu ostatných. Američan vstane, vypije poslednú whisky v bare, pobozká najprsatejšiu letušku a s výkrikom: \r\n- Som Batman! Som Superman! vyskočí. Keď sa výška opäť zníži, vstane Francúz, nie je predsa o nič menší hrdina než Američan. Vypije pohár červeného vína, pobozká na rozlúčku všetky letušky, zvolá: \r\n- Viva la France! vyskočí. Zase to na chvíľku pomohlo, ale breh je ešte ďaleko, tak vstane Slovák, vypije všetky zbytky v bare, pobozká všetky ženy v lietadle a s výkrikom: \r\n- Nech žije Keňa! vyhodí von černocha.              ', 856, 4.28, 21),
	(4680, 'Napoleon odpočíval vo svojom stane, keď tu náhle vrazil dovnútra sluha a volá: \r\n"Pane, Angličania! Prichádzajú! Je ich desaťtisíc!!" \r\n"Dobre, Jeane, prineste mi moju červenú košeľu." \r\nPotom Napoleon odišiel a po pár hodinách sa vrátil z víťaznej bitky. Sluha sa ho pýta, na čo mu bola tá červená košeľa a Napoleon odpovedá: \r\n"Milý Jeane, to je psychologická záležitosť. Keď mám červenú košeľu, vojaci neuvidia krv, keby som bol zranený a taktiež sa nebudú obávať, že by som mohol zomrieť." \r\nO pár hodín neskôr opäť sluha pribehne: \r\n"Pane, Angličania! Prichádzajú! Je ich tridsaťtisíc!!" "Dobre, Jeane, prineste mi moju červenú košeľu." \r\nOpäť sa Napoleon vráti z bitky ako víťaz. Na druhý deň ráno sluha pribieha a volá: \r\n"Pane, Angličania! Prichádzajú! Je ich tristotisíc! \r\n"No, Jeane myslím, že je čas na moje hnedé nohavice."              ', 928, 4.08, 21),
	(4681, 'Žil raz jeden otec a mal peknú dcéru. Jedného dňa sa im upchala kanalizácia, tak zavolali inštalatéra. Keď prišiel, dcéra mu nenápadne pošepla: \r\n- Otec ti bude za prácu všeličo núkať. Zlato, striebro, peniaze, slivovicu, ale ty nič neber, len si pýtaj starú hrdzavú podkovu. Inštalatér päť hodín čistil kanály a keď bol sprácou hotový núkal mu otec zlato, šperky, peniaze, slivovicu, ale inštalatér trval na tom, že chce len hrdzavú podkovu. Tak sa aj stalo. Keď inštalatér odišiel, hovorí otec dcére: \r\n- Ale sme s ním pekne vybabrali, čo?              ', 601, 4.01, 21),
	(4682, 'Dôjde žena do hračkárstva a hovorí predavačovi:\r\n„Viete, ja mám takú múdru, inteligentnú a šikovnú dcéru. Preto by som jej chcela kúpiť nejaké puzzle, skladačky, alebo niečo podobné."\r\nPredavač odíde dozadu a donesie jej 500 puzzle. Žena však vraví:\r\n„Veď som vám hovorila, že je to múdre dieťa, toto je pre ňu nič."\r\nPredavač znova odíde dozadu a donesie jej 1000 puzzle. Žena však znova nie je spokojná.\r\n„Ona je veľmi inteligentné dieťa, nemáte tam niečo ťažšie?"\r\nPredavač donesie zozadu 2000 puzzle, no žena je znova nespokojná. Predavač to už nevydrží\r\na hovorí:\r\n„Pani, tak viete čo? Choďte oproti do potravín, tam kúpte strúhanku a nech vám to vaše inteligentné dieťa poskladá rohlík.              ', 777, 4.17, 21),
	(4683, 'Stajňa Ferrari zistila, že skupina nezamestnaných mladíkov z Liverpoolu dokáže v neuveriteľne krátkom čase ukradnúť pneumatiky z auta - a to bez špeciálneho náradia. Vyskúšali si ich schopnosti na pretekárskych monopostoch a kompletnú výmenu pneumatík mládenci zvládli pod 4 sekundy. A keďže preteky sa dnes vyhrávajú skôr v depe ako na trati, pôvodný tím mechanikov bol prepustený a príležitosť dostali mládenci. Objavil sa však závažný problém. Pri prvých pretekoch partia síce pneumatiky vymenila za menej ako 4 sekundy - ale v priebehu ďalších 10 sekúnd monopost prestriekali, premaľovali mu štartovné číslo, predali ho stajni McLaren a zmizli.              ', 713, 4.21, 21),
	(4684, 'Matfyzák č. 1 príde neskoro na prednášku, kde už nasupený profesor prednáša a pýta sa ho prečo prišiel neskoro.\r\n- Viete, ja som zaspal, tak som si osedlal koňa a išiel som do školy. Na námestí Republiky mi kôň zdochol, kvôli tomu smogu, čo tam je. \r\nPrednášajúci vykladá ďalej. O chvíľu príde matfyzák č. 2:\r\n- Ráno som zaspal. Keďže som sa ponáhľal, osedlal som si koňa a išiel som do školy. No, na námestí Republiky, pretože je tam ten veľký smog, mi kôň zdochol. \r\nPrednášajúci ich už má plné zuby. O päť minút príde matfyzák č. 3 a profesor už vybuchne:\r\n- Aj vám zdochol kôň?!\r\n- No, ja som ráno zaspal. A keď som išiel normálne päťkou do školy, tak na námestí Republiky bola zápcha, pretože tam ležali nejaké zdochnuté kone.              ', 821, 4.17, 21),
	(4685, 'V krčme na Záhori nie sú ojedinelé stávky rôzneho drhu. Raz tak strýc Francek hovorí strýcovi Janovi:\r\nNá, Jane stav sa o púl deci borovičky, že ti dokážem na špičku nosa nasrat enem taký maučký bobeček.\r\nStavili sa. Strýc Ján si ľahol na chrbát, strýc Francek stiahol nohavice a našteloval sa holým zadkom nad nos strýca Jana. Naraz Strýc Francek si uľavil a strýc Ján mal na tvári kopu, ako keď vysypeš pól vedra zhnitých zemiakov.\r\nStrýc Ján si pretre oči a smeje sa. Strýc Francek na neho: Ná co sa smjeješ jak buázen. A strýc Ján na to: Já sem vjedzeu, že prohráš, uš ked sem uvidzeu jak sa ti rit otevíra.              ', 678, 4.1, 21),
	(4686, 'Chlapík sa kúpe v jazere, keď ho zrazu niečo začne strašne ťahať za gule. Z hlbín sa ozve: "Plus dve, alebo mínus dve? "Chlap nechápe, ale stále ho to silnejšie\r\nťahá pod vodu, tak zakričí: "Plus dve!"\r\nŤah povolí a chlapík v pohode dopláva k brehu. Ale keď vylezie z vody, zistí, že má 4 gule. Tak skočí do vody, že keď ho to začne znova ťahať, tak zakričí mínus dve a bude to v pohode. Pláva pláva.. a zrazu ešte silnejší ťah za gule.. a z hlbín sa ozve: "Plus štyri, alebo mínus štyri?"\n', 535, 3.95, 21),
	(4687, 'Múdry vraví hlúpemu:\r\n- Ty, počuj, dám ti hádanku. Keď ju neuhádneš, dáš mi päť korún, potom, ak ja neuhádnem tvoju, dám ti sto korún.\r\nHlúpy súhlasil. Múdry vraví:\r\n- Má to štyri nohy a sedí sa na tom, čo je to?\r\nHlúpy:\r\n- Čo ja viem, tu máš päť korún.\r\nHlúpy dáva hádanku:\r\n- Má to päť nôh, niekedy aj šesť a lozí to po stene, čo je to?\r\nMúdry premýšľa, nechce sa dať zahanbiť a napokon vraví:\r\n- Neviem, tu máš sto korún. Čo to je?\r\nA hlúpy vraví:\r\n- Vieš čo, ani ja neviem, tu máš päť korún!              ', 572, 3.85, 21),
	(4688, 'Žena má v posteli milenca. Zrazu niekto zvoní. Žena príde k dverám a zistí, že prišiel manžel. Vbehne do spálne a hovorí milencovi, aby rýchlo odišiel, pretože manžel je strašne žiarlivý a zabil by ho. Muž holý vyskočí z okna. Akurát sa beží maratón, a tak sa pridá. Po chvílke sa ho pýta spolubežec:\r\n”Prečo nemáte číslo?”\r\n”Viete, je horúco, mohol by som sa zapariť a dostať nejaké vyrážky.”\r\nPo piatich minútach sa ho opäť pýta:\r\n”Prečo nemáte ani trenírky?”\r\n”Viete, je horúco a mohli by sa mi zapariť stehná.”\r\nPo piatich minútach sa ho opäť pýta:\r\n”A prečo bežíte bez topánok?”\r\n”Viete, je horúco a tie ekzémy.”\r\nTak bežia ďalej a opäť sa ho spolubežec pýta:\r\n”A ten prezervatív, to máte načo?”\r\n”No viete, až tak horúco zase nie je.”	              ', 859, 4.18, 21),
	(4689, 'Príde Fero Taraba do kvetinárstva a pýta si:\r\n- Prosím si štyri begónie.\r\n- Begónie nemáme, mohli by to byť petúnie? - odpovie predavačka.\r\n- Nemohli! - povzdychne si Fero\r\n- Zajtra sa mi vráti manželka z kúpeľov a ja som mal polievať begónie.              ', 274, 3.69, 21),
	(4690, 'Na hraničnom priechode sa pýta Kohn colníka:\r\n- Pane, je možné vyvážať zlato do Francúzska?\r\n- Samozrejme. No v primeranom množstve. - odpovie colník.\r\n- A stodesať kilogramov je primerané množstvo?\r\n- Tak to určite nie!\r\n- Tak v tom prípade, - obráti sa Kohn k manželke - zlato moje, ostávaš doma.              ', 332, 3.67, 21),
	(4691, 'Mám dve krásne deti. \r\nDve z piatich, to vôbec nie je zlý pomer.              ', 82, 3.57, 21),
	(4692, 'Lepšie je byť ticho a byť považovaný za hlupáka, ako otvoriť ústa a vyvrátiť všetky pochybnosti.\n', 108, 4.11, 21),
	(4693, 'Sedia dvaja veľmi smutní informatici v serverovni, príde k nim tretí a pýta sa:\r\n- A čože ste takí smutní?\r\n- No... včera sme sa trošku ožrali a menili sme heslá ...              ', 192, 4.05, 21),
	(4694, '"Sused, videli ste, akého strašiaka si Jožo postavil na pole?"\r\n"Nie."\r\n"Takého strašného, že mu vrany vrátili aj minuloročnú úrodu."              ', 158, 4.14, 21),
	(4695, 'Kapitán sa pýta telefónom strojníka:\r\n- Koľko? \r\nStrojník odpovedá:\r\n- 35!\r\n- Čo 35?\r\n- A čo koľko?              ', 123, 4.05, 21),
	(4696, '"Čo to vravíš Tomáš, že v malíku to máš?" V tom je chyba práve, že to nemáš v hlave!              ', 111, 3.67, 21),
	(4697, 'Nikdy neverte jasu v očiach krásnej ženy. Je to iba slnko, ktoré presvitá cez jej dutú hlavu.              ', 113, 4.11, 21),
	(4698, 'Dvaja právnici šli na večeru. Objednali si každý kávu a vytiahli sendviče. Servírka pribehla a hovorí:\r\n"Páni, u nás nesmiete konzumovať vlastné potraviny!"\r\nObaja právnici sa na seba len pozreli, pokrčili ramenami a vymenili si sendviče.              ', 268, 4.23, 21),
	(4699, 'Pýtajú sa Deža, ktorý je odsúdený na smrť:\n"Čo si želáte na svoju poslednú večeru?"\n"Pečenú morku a fľašu vína - ročník 2019."\n', 146, 4.27, 21),
	(4700, '"Tak čo, Dežo, už si si našiel prácu?"\n"Našiel, našiel. Ale pretože som poctivý človek, tak som ju aj hneď vrátil..."\n', 130, 4.23, 21),
	(4701, 'Viete ako sa sprchuje zahorak???Čúra oproti vetru.', 52, 3.29, 21),
	(4702, 'Dvaja stavbári na lešení Fero vidíš tu muchu na konci lešenia? Ktorú? Zlá viditeľnosť balíme..', 105, 3.24, 21),
	(4703, 'Stojí vo výťahu upratovačka.\r\nNa 1. poschodí nastúpi mladá, zjavne bohatá dáma, strekne na seba voňavku a arogantne poznamená:\r\n,,Chanel No. 5. Londýn, 50 eur za mililiter."\r\nNa 2. poschodí nastúpi mladá herečka, tiež zjavne bohatá, strekne na seba voňavku, pozrie sa na obidve a povie:\r\n,,Gucci Romance. Peking, 100 eur za mililiter."\r\nNa 3. poschodí upratovačka vystúpi, nahlas si uľaví a povie:\r\n,,Lidl - brokolica. Ružomberok, 15 korún za kus.', 473, 4.05, 21),
	(4704, 'Ľudia sa delia do troch skupín: \r\n1. na tých, čo vedia počítať\r\n2. na tých, čo počítať nevedia', 106, 3.18, 21),
	(4705, 'Dva leňochody, bez pohybu, ležia na konári. Prejde prvý deň, druhý, tretí a na štvrtý deň\r\nzačne jeden otáčať hlavu. Na to mu druhý hovorí:\r\n"Nestresuj..." \r\n', 174, 3.56, 21),
	(4706, '- Viete prečo had nemá gule?\r\n- Lebo by vyzeral ako penis...', 62, 3.59, 21),
	(4707, 'Policajt zastaví Deža: "Dežo, doklady!"  A Dežo mu odpovie: "A od čoho?"', 77, 3, 21),
	(4708, '- Viete čo je to najväčšia bitka? - Keď sa dvaja holohlaví bijú o hrebeň.', 81, 3.86, 21),
	(4709, 'Na ulici stretnú digitálne hodinky ručičkové, chcú byť zdvorilé, a tak sa pozdravia: "Dobrý deň, ručičky bozkávam."', 128, 3.07, 21),
	(4710, 'Rozprávajú sa dvaja kozmonauti vo vesmíre. A jeden druhému hovorí: "Ty sa na mňa ani nepozeraj, ja som dvere nezabuchol!"\r\n', 129, 3.03, 21),
	(4711, 'Fero po druhom infarkte sa pýta lekára: -"Pán doktor, môžem si ešte zapáliť?" -"No ak je to vaše posledné želanie..." - prikývne doktor.', 148, 3.97, 21),
	(4712, '- "Vieš, aký je rozdiel medzi mnou a tebou?" - pýta sa Jožo Fera.\r\nFero mu odpovedá: "Neviem, aký?"\r\nJožo: "Žiadny, obaja sme teplý."', 142, 3.42, 21),
	(4713, 'Vletí chlap do baru a zakričí:\r\n- Kto mi natrel všetky kone v stajni na žlto?!\r\nPostaví sa svalnatý Mareček:\r\n- Ja, no a?!!\r\nChlap sa stiahne a hovorí:\r\n- Nuž, ja len, že si vybral dobrý odtieň!\r\n', 209, 3.58, 21),
	(4714, 'Janko so sestričkou sa nudia a tak Janko navrhne, aby sa išli hrať na opičky. Sestrička sa súhlasí ale nevie ako. A Janko jej vraví: "To je ľahko, ja budem opička a ty ma budeš kŕmiť orieškami."', 208, 2.69, 21),
	(4715, 'Práve potom, čo vybuchol Černobyl, pýta sa učiteľ v škole detí, čo by sa stalo, keby na Slovensku vybuchla jadrová elektráreň. A Dežko odpovedá: "Vymenili by sme si s nimi hymnu. Oni by spievali Kde domov můj, a my by sme spívali Nad tatrou sa blýska".  ', 271, 3.35, 21),
	(4716, 'Chlapi stavajú vysoký komín, už ho majú skoro hotoví. Až k ním pribehne vedúci a povie:"Chlapi stojte, ja som otočil stavebný plán mali sme kopať studňu!"\r\n', 170, 3.75, 21),
	(4717, 'Pán doktor, minule ste mi predpísali nejaké nové lieky!\r\n- Podľa čoho tak usudzujete?\r\n- Lebo tie staré, keď som ich vyhodil do záchodu, sa potopili, a tie nové stále plávajú.', 188, 3.44, 21),
	(4718, 'Pri koľajniciach stojí hluchý, slepý a beznohý.\r\nHluchý hovorí:\r\n"Už počujem vlak!"\r\nSlepý hovorí:\r\n"Už vidím vlak!"\r\nA beznohý odpovie:\r\n"Tak utekajme!"\r\n', 169, 3.95, 21),
	(4719, 'Viete,čo je to maximálna zdvorilosť?Vyskočiť z okna a ešte ho za sebou zavrieť.', 86, 3.46, 21),
	(4720, 'Viete ako sa po čínsky povie pes?\r\nŠikanamurik.\r\nViete ako sa po čínsky povie mucha?\r\nSerenašibu.\r\nA...viete ako sa volal prvý vynálezca stanu?\r\nNačochata.', 164, 3.67, 21),
	(4721, 'Moje motto znie:\r\n"Radšej zomrieť na AIDS od peknej dievčiny, ako na INFARKT od škaredého šéfa!"', 103, 4.14, 21),
	(4722, 'Chuck Norris sa raz vymočil Schumacherovi do nádrže a odvtedy len vyhrával..', 80, 3.67, 21),
	(4723, 'Človek, ktorý znásilňuje chlór sa nazýva chlorofyl.', 57, 3.33, 21),
	(4724, 'Chuck Norris dokáže páliť mravce lupou. V noci.\r\n\nSlzy Chucka Norrisa liečia rakovinu. Škoda, že nikdy neplakal. \r\n\nNa poslednej stránke Guinnessovej knihy svetových rekordov je malým písmom uvedené, že všetky rekordy drží Chuck Norris, tu uvedení ľudia sú tí, čo sú mu najbližšie. \r\n\nNie sú žiadne odlišné rasy, iba zem plná ľudí, ktoré Chuck Norris zbil do rôznych odtieňov čiernej, modrej a žltej. \r\n\nChuck Norris si v KFC objednal BigMac a dostal ho. \r\n\nV Iraku neboli žiadne zbrane hromadného ničenia. Chuck Norris žije v Oklahome.\r\n\nNa Nagasaki nikdy žiadna bomba nespadla, to len Chuck Norris vyskočil z lietadla a udrel do zeme. \r\n\nV priemernej obývacej izbe je 1242 vecí, pomocou ktorých by Vás Chuck Norris dokázal zabiť, vrátane samotnej izby. \r\n\nChuck Norris nespí, iba čaká. \r\n\nZbrane nezabíjajú, to Chuck Norris. \r\n\nHlavné príčiny smrti v USA sú: 1.Onemocnenie srdca, 2.Chuck Norris, 3.Rakovina. \r\n\nChuck Norris nečíta knihy, len ich poriadne zmačkne a dostane informácie, ktoré potrebuje. \r\n\nChuck Norris je tak rýchly, že môže obehnúť Zem a udrieť sa do chrbta. \r\n\nChuck Norris nenosí hodinky, on proste určí koľko je hodín. \r\n\nVäčšina ľudí má 23 párov chromozómov, Chuck ich má 72 a všetky sú smrteľné. \r\n\nChuck Norris pozná posledné číslo čísla Pí. \r\n\nNiektorí ľudia majú jednu mozgovú hemisféru väčšiu ako druhú, Chuck Norris má väčšie obidve.\r\n\nChuck Norris vynašiel celé spektrum farieb, okrem ružovej, tú vynašiel Tom Cruise!!!\r\n\nChuck Norris vie roztiahnuť diamant a premeniť ho na uhlie. \r\n\nŽiadne globálne otepľovanie neexistuje, to iba Chuck Norris priblížil Slnko, keď mu bolo chladno.\r\n\nZa každým úspešným mužom je žena, za každým mŕtvym mužom je Chuck Norris. \r\n\nKeď Boh povedal "budiš svetlo", Chuck Norris počkal kým poprosí. \r\n\nChuck Norris raz kopol koňa do brady. Jeho potomkovia sú dnes známi ako žirafy. \r\n\nOzzy Osbourne odhrýza hlavy netopierom, Chuck Norris to robí tigrom usurijským. \r\n\nChuck Norris vie robiť bubliny z hovädzích steakov. \r\n\nKeď sa hovorí "nikto nie je dokonalý" Chuck Norris to považuje za osobnú urážku. \r\n\nChuck Norris spí s vankúšom pod pištoľou. \r\n\nChuck Norris nemá bankoví účet. Vždy iba oznámi banke koľko potrebuje. \r\n\nČas na nikoho nečaká... ak to nie je Chuck Norris. \r\n\nChuck Norris dokáže vyhrať hru Dostihy bez toho, aby vlastnil jediného koňa.\r\n\nChuck Norris dokázal že sme vo vesmíre sami. Pred jeho prvou vesmírnou expedíciou sme neboli. \r\n\nChuck Norris raz navštívil Panenské ostrovy. Teraz sa volajú Ostrovy. \r\n\nChuck Norris nemal nikdy problém s alkoholom. Avšak alkohol má problém s Chuckom Norrisom.\r\n\nNa konci dielu Walker: Texas Ranger nejde zoznam hercov, ale zoznam úmrtí behom natáčania.\r\n\nScéna,v ktorej Chuck Norris prehrá súboj s Brucom Lee, bola scéna s najdrahšími špeciálnymi efektami v histórii kinematografie všetkých čias. \r\n\nChuck Norris vymyslel rakovinu pretože bol unavený so zabíjania ľudí.\r\n\nChuck Norris nenecháva správy, necháva varovania.\r\n\nKeď Arnold v druhom Terminátorovi hovorí "Ja sa vrátim" myslí tým, že ide požiadať o pomoc Chucka Norrisa.\r\n\nChuck Norris raz prežil samovražedný atentát.\r\n\nAk ti Chuck Norris ukáže prostredník, ukazuje ti koľko sekúnd života ti ostáva.\r\n\nVeľký Čínsky múr bol pôvodne postavený, aby zabránil Chuckovi Norrisovi vstúpiť do Číny. Žalostne sklamala.\r\n\nLen chuck norris dokáže svojmu nepriateľovi odtrhnúť hlavu a hodiť mu ju do xichtu.', 3624, 4, 21),
	(4725, 'Chuck Norris sa vie tak rýchlo zobudiť, že sa pristihne ako ešte spí.\r\n\nChuck Norris dokáže tlieskať jednou rukou.\r\n\nChuck Norris si dá hlavu za nohu.\r\n\nChuck Norris vie hovoriť brilovým písmom.\r\n\nChuck Norris vie koktať v posunkovej reči.\r\n\nBoh chcel stvoriť Zem za mesiac, ale Chuck Norris mu dal len 7 dní.\r\n\nJežiš vedel chodiť po vode, ale Chuck Norris vie chodiť po Ježišovi.\r\n\nKeď Chuck Norris robí zhyby na hrázde, nedvíha sa. Sťahuje zemeguľu dole.\r\n\nChuck Norris vyhral Superstar bez jediného vydania tónu.\r\n\nMimozemštania existujú! Len dovtedy nezaútočia, kým Chuck Norris nezomrie.\r\n\nChuck Norris dokáže urobiť dieru do vody.\r\n\nChuck nesmrdí, to smrad Chuck Norrisuje...\r\n\nChuck Norris spôsobuje cigarete rakovinu.\r\n\nChuck Norris sa raz holil a porezal žiletku.\r\n\nChuck Norris vie naštartovať auto bez motora.\r\n\nKeď sa Chuck Norris narodil, jediný kto plakal v miestnosti, bol doktor. Nikdy sa nedotýkaj Chucka Norissa.\r\n\nRaz prišla pre Chucka Norrisa smrť, ale Chuck ju dobehol a zabil. Takže pre teba si už príde Chuck Norris.\r\n\nChuck Norris dokáže tresnúť otáčacími dverami.\r\n\nChuck Norris nemá tieň, lebo ho už štvalo, že ho niekto imituje.\r\n\nChuck Norris poskladá Rubikovu kocku tromi ťahmi, bez použitia končatín.\r\n\nChamberlainov rekord je 2000 žien za celý život, Chuck Norris to nazýva ako jeden ľahký štvrtkový deň.\r\n\nChucka Norrisa raz matka nazvala Charles. Raz.\r\n\nChuck Norris bol na dovolenke v Španielsku a naháňal vystrašených býkov po uliciach.\r\n\nChuck Norris sa narodil v zrube, ktorý si sám postavil.\r\n\nKeď vyhláskuješ Chuck Norris v Kris Krose, vyhráš. Navždy.\r\n\nChuck Norris raz zjedol tri 72-librové steaky za hodinu. Z toho 45 minút strávil sexom so servírkou.\r\n\nChuck Norris raz spadol do jazera s toxickým odpadom. Jazero získalo zázračné schopnosti.\r\n\nKeď hrá Chuck Norris Monopoly, tak to má vplyv na celú svetovú ekonomiku.\r\n\nChuck Norris raz zostrelil nemecké lietadlo tým, že naň ukázal a zakričal "Bang!"\r\n\nChuck Norris bol raz v súťaži Koleso Šťastia a točil ako prvý. Ostatných 29 minút televíznej show sa čakalo či sa koleso zastaví.\r\n\nKeď Chuck Norris behal okolo Zeme tak si kopal do riti.\r\n\nChuck Norris raz vypadol z okna, z prvého poschodia na deviate.\r\n\nChuck Norris ako prvý pravý texaský ranger a indián telefonuje v púšti s mobilom.\r\n\nChuck Norris uhádol v lote 8 čísel zo 7 \r\n\nChuck Norris dokáže chatovať v reálnom živote.\r\n\nKeď si Chuck Norris odpľuje tak urobí dieru do zeme.\r\n\nChuck Norris sa nedokáže opiť, je to alkohol čo sa opije z Chucka Norrisa.\r\n\nChuck Norris sa prvý krát pobil ešte ako spermia.\r\n\nChuck Norris vie robiť kotrmelce hore schodmi.\r\n\nChuck Norris je schopný leopardovi ukradnúť jedlo s papule pri behu.\r\n\nChuck Norris raz oplodnil dážďovku, a tej sa potom narodila anakonda.\r\n\nZamaskovaný muž raz bodol Chucka Norrisa v temnej uličke za detskou nemocnicou... nôž vykrvácal.\r\n\nChuck Norris musel prestať prať prádlo v oceáne, tsunami zabíjalo.\r\n\nOstatní ľudia žuvajú žuvačku, Chuck Norris žuvá titan.\r\n\nMacGyver vie vyrobiť výbušninu z hovna, Chuck Norris vie vyrobiť výbušninu z MacGyvera.\r\n\nChuck Norris je taký rýchly, že počas búrky sa vyšplhá po blesku doprostred búrkového mračna, nazbiera si tam ľadové kryštáliky, vráti sa do izby a dá si tam obľúbený bourbon s ľadom, skôr ako zahrmí.\r\n\nChuck Norris stratil panictvo skôr ako jeho otec.\r\n\nChuck Norris vie nakresliť dúhu modrým perom.\r\n\nChuck Norris vie z orechov spraviť makovník.\r\n\nChuck Norris sa v daždi dokáže uhýbať kvapkám.\r\n\nPár ľuďom sa podarilo zísť dolu Niagárske vodopády v drevenom sude, Chuck Norris ich zišiel nahor v lepenkovej krabici.\r\n\nKeď je Chuck Norris dlho vo vode, voda sa začne dusiť.\r\n\nChuck Norris nepočúva hudbu, hudba počúva jeho.\r\n\nChuck Norris si vie natrieť chleba na maslo.\r\n\nChuck Norris si nechal nastreliť fúzy – samopalom.\r\n\nChuck Norris zjedol krabičku liekov na spanie a spôsobilo to to, že žmurkol.\r\n\nChuck kopal z otočky tak rýchlo, že sa začal vracať späť v čase.\r\n\nChuck Norris odohrá akúkoľvek klavírnu skladbu na bassgitare bez strún.\r\n\nChuck Norris ťa kopne s rukou.\r\n\nChuck Norris vie, kde je stred vesmíru on ho určil.\r\n\nÚtok na Chucka Norrisa polícia definuje ako samovraždu.\r\n\nHelikoptéra bola vynájdená potom, ako konštruktéri videli Chucka Norrisa, ako za 5 sekúnd kopol 20 krát z otočky.\r\n\nChuck Norris je schopný fotosyntézy.\r\n\nChuck Norris plodí deti s IQ nad 160.\r\n\nBoh nestvoril Zem 7 dní. Mal ju hotovú za 10 minút. Zbytok času pracoval na Chuckovi Norrisovi.\r\n\nChuck Norris musí využívať kaskadéra na scény, v ktorých plače.\r\n\nChuck Norris vyhral v súťaži Coca-Cola po odovzdaní piatich vrchnákov s textom "Skús štastie znova".\r\n\nChuck Norris má takého veľkého vtáka, že aj jeho vták má cikulu, ktorá je väčšia ako tvoja.\r\n\nVo filme Matrix je Matrixom Chuck Norris. Keď budete dávať dobrý pozor pri scénach s padajúcím zeleným kódom, môžete vidieť slabé obrysy jeho bradky.\r\n\nChuck Norris zabehol 12-minútovku za 6 minút.\r\n\nChuck Norris raz zjedol tortu skôr, ako mu stihli povedať že v nej bola striptérka.\r\n\nBermudský trojuholník bol pôvodne štvorec, kým Chuck Norris neodkopol jeden roh.\r\n\nChuckovi Norrisovi nehľaď na zuby, lebo ti vykusne oči.\r\n\nChuck Norris v detstve nikdy nepomočil postel. Postel sa zo strachu pomočila sama.\r\n\nChuck Norris neužívá steroidy. Steroidy užívajú Chucka Norrisa.\r\n\nInformácia o tom, že Chuck Norris napočítal dvakrát "len" do nekonečna nie je aktuálna. Chuch Norris totiž napočítal aj omnoho ďalej.\r\n\nKeď sú ľudia v núdzi, modlia sa k Bohu......a Boh sa spýta Chucka Norrisa čo by urobil on....\r\n\nChuck Norris vie kto zabil Kenedyho.\r\n\nChuck Norris si raz hodil mincou... padol znak, ale aj jedno lietadlo. Verejnosť to pozná.', 6014, 4, 21),
	(4726, 'Na jedinej masovej vražde sa Chuck Norris nezúčastnil osobne. Bola to tá, v ktorej svoje otočky poslal reťazovým e-mailom.\r\n\nChuck Norris prinúti vodu tiecť do kopca.\r\n\nKameň porazí nožnice, nožnice porazia papier, papier porazí kameň. Chuck Norris porazí všetky 3 naraz.\r\n\nChuck Norris sa kvalifikoval do závodu Daytona 500 maximálnou rýchlosťou 324 míl za hodinu. Bez auta.\r\n\nChuck Norris je jedným z božích bratov. Ježíš je jeho slabší brat!\r\n\nGoogle nebude hľadať Chucka Norrisa, pretože vie, že ty nenájdeš jeho, ale on si nájde teba !!!!!\r\n\nAko dosvedčuje NASA, Chuck Norris je jediným človekom, ktorý je okom viditeľný z vesmíru.\r\n\nPee Wee Herman bol zatknutý za masturbovanie na verejnosti. Chuck Norris za masturbovanie na verejnosti dostal cenu.\r\n\nModerné čistiace prostriedky uvádzajú, že zničia 99.9% mikróbou. Chuck Norris zničí 100% čohokoľvek, keď sa mu zachce.', 933, 2.68, 21),
	(4727, 'Otec sa vrátil zo služobnej cesty a hovorí synovi: \r\n- "Janko hádaj, čo som ti priniesol?"\r\n- "Nič."\r\n- "Ty beťár jeden, zase si to uhádol."', 149, 4.21, 21);
INSERT INTO `mig_jokes` (`id`, `joke`, `joke_length`, `rank`, `category_id`) VALUES
	(4728, 'Príde babka ku gynekológovi a hovorí:"Pán doktor, mám nejaký hnedý výtok."\r\nDoktor jej odpovedá: "To je hrdza babka, to je hrdza!"', 139, 3.69, 21),
	(4729, 'Chuck Noris sedí rýchlejšie než beží.', 43, 3.08, 21),
	(4730, 'Viete prečo sa trpaslík smeje keď ide do roboty?\r\nLebo ho šteklí tráva po guľkách.', 90, 4.29, 21),
	(4731, 'Muž v lietadle zastaví letušku a sťažuje sa jej:\r\n- Viete, ja mám takú smolu, mne sa vždy niečo zlé prihodí.\r\n- Nemusíte sa báť, tu sa vám určite nič nestane.\r\nO 5minút sa z reproduktorov ozve:\r\n- Lietadlo havaruje a spadne rovno do mora. Nemusíte sa báť, letušky vám dajú píšťalky na odplašenie žralokov.\r\nMuž opäť zastaví letušku a zas sa sťažuje:\r\n- Vidíte, a teraz buď natrafím na hluchého žraloka alebo vyfasujem píšťalku bez dierky.', 482, 4.26, 21),
	(4732, 'Prečo Záhoráci sťahujú skriňu traja?\rDvaja ju nesú a tretí drží vešiaky.', 83, 4.18, 21),
	(4733, 'Lev hovorí zvieratám v lese:\r\n-Kto skočí z tejto skaly, zaplatím mu milión dolárov!\r\nPotom zlezie zo skaly a dolu čaká na odvážlivcov, keď zrazu zo skaly zletí veľký medveď. Bez zranenia sa postaví a lezie späť. Lev nechápavo krúti hlavou:\r\n- Počkaj, veď si vyhral ten milión!\r\nA medveď nahnevane odvrkne:\r\n- Čakaj, najprv zabijem toho, kto ma sotil!', 376, 4.02, 21),
	(4734, 'Zajačik nájde na zemi hovno. Ide okolo práve medveď a zajačik hovno skryje pod labky. Medveď sa pýta zajačika:\r\nZajačik, čo to tam máš?\r\nZajačik: Nič medveď...\r\nMedveď: Zajac, povedz čo to tam máš, lebo ťa zjem.\r\nZajačik: Motýľa medveď, motýľa.\r\nMedveď: Ukáž.\r\nZajac: Nie.\r\nMedveď: Zajac kurňa...\r\nZajac otvorí labky a medveď hovorí:\r\nÓóó, ty vole, aký je rýchly a aké hovno vysral...', 424, 3.86, 21),
	(4735, 'Pýta sa 18-ročný chlapec otca: "Oci, a keď prídem domov opitý, zbiješ ma?" \r\nOtec mu hovorí: "No to nie, ani sa ťa nedotknem."\r\nA tak ide syn večer von, opije sa a príde domov. Ráno sa celý ubolený pýta svojho otca: "Oci, ty si ma zbil?"\r\nOtec mu hovorí: "Áno." \r\n"Ale prečo", pýta sa syn, "veď si mi povedal, že aj keď prídem opitý, tak ma nezbiješ."\r\n"No vieš, to že si pred dverami vynadal svojej mame, to by mi nevadilo. To že si tiež vynadal aj svojej sestre, to tiež nie je až také hrozné. Ale to, že si sa vysral pred náš televízor, potom si do toho napichal špáradlá a nakoniec si nám povedal, že to je ježko a odteraz bude s nami bývať, tak to ma už vážne nasralo.', 721, 4.21, 21),
	(4736, 'Dvaja kamoši kráčajú už pol dňa po brehu rieky, keď naraz nájdu neotvorenú konzervu mäsa. Jeden ju zodvihne, obzrie si ju a prehodí na opačný breh. Kamarát sa ho pýta:\r- Ja som hladný a ty tú konzervu prehodíš na druhý breh!? Prečo!? Veď sme ju mohli zjesť. \r- Nehnevaj sa, ale bolo na nej napísané: "Otvoriť na druhej strane."', 353, 3.78, 21),
	(4737, 'Ide otec so synom okolo bordelu a syn sa ho pýta: "Ocko, čo je toto za dom?"\r\nOcko sa začervená a hovorí: "To je dom radosti."\r\nNa druhý deň sa ide synček pozrieť do "Domu radosti". Na chodbe stretne kuchárku a ona sa ho pýta: "A ty tu čo robíš?"\r\n"Ocko povedal, že toto je dom radosti, tak ukáž akú radosť mi urobíš!"\r\nKuchárke to zapne a povie: "No tak poď, urobím ti radosť." A urobila mu palacinky.\r\nSynček príde domov a ocko sa ho pýta kde bol. Syn mu povedal, že v dome radosti. Ocko sa zadiví, začervená a pýta sa: "A ako bolo?"\r\n"No prvé dve som zvládol, ale tú tretiu som len vylízal."', 631, 4.13, 21),
	(4738, 'Príde žena do väzenia a hovorí bacharovi:\r\n- Nemohli by ste môjmu mužovi dať nejakú ľahšiu prácu?\r\n- Myslíte si, že nalepovanie známok je ťažká práca?\r\n- Nalepovanie? Mne hovoril, že kope tunel, či čo.', 222, 3.57, 21),
	(4739, 'Viete čo je to maximálna lakomosť?\r\nKeď nevydychuješ, len aby si si mohol nechať všetok oxid uhličitý pre seba!', 120, 3.19, 21),
	(4740, '- Prečo si na noc zakrývate studňu?\r\n- Aby nám z nej v noci, ked sa Zem otáča, nevytiekla voda! ', 102, 3.46, 21),
