	(4745, 'Predám auto s nehrdzavejúcou, pontónovitou karosériou, nepodliehajúcou módnym vplyvom, s dvojtaktným motorom pracujúcim na princípe náhodných výbuchov.\r\nZn.: Wartburg 323 Sedan', 188, 3.04, 22),
	(4746, 'Nie som pekný ako Brad Pitt, nie som rýchly ako Jean-Claude Van Damme, nemám pozadie ako Mel Gibson, nie som bohatý ako Bill Gates, ale VIEM LÍZAŤ AKO LASSIE!!!', 166, 3.49, 22),
