	(4760, '- Predám auto s pontonovitou karosériou nepodliehajúcou módnym vplyvom, s dvojtaktným motorom pracujúcim na princípe náhodných výbuchov. \r\nZn.: Wartburg 323 sedan.', 173, 3.4, 22),
