	(4762, 'Inzerát v novinách:\r\nChcel by som sa zoznámiť s peknou, inteligentnou blondínkou, miery 90-60-90, modré oči, bohatou, s bytom a autom.\r\nV skratke o sebe - 30 cm.', 168, 3.32, 22),
