	(5188, 'Staví sa Slovák, Rus a Čech, kto dlhšie vydrží v soľnej jaskyni. Prvý ide Rus. Vydrží 5 min a vráti sa späť celý doštípaný. Ostatní sa ho pýtajú, prečo je doštípaný a Rus im povie, že vo vnútri sú komáre. Druhý ide Čech. Ten vydrží o niečo dlhšie, ale tiež vyjde von po chvíli celý doštípaný. Ako posledný ide Slovák. Ten ani po 10-tich hodinách stále nevychádza. Keď už vyjde von je úplne bez štipancov. Ostatní sa ho pýtajú ako to dokázal a Slovák im odpovedá: "Zabil som jedného komára a ostatní mu išli na pohreb."', 577, 3.63, 23),
