	(5219, 'Čo by ste urobili, ak by ste boli v lese na strome a pod vami lev, puma, jaguár a medveď?Riešenie: Zastrelíte leva, obujete si pumy, nasadnete do jaguára a zrazíte medveďa.', 180, 3.59, 23),
