	(5225, '- Čo spraví žirafa, keď jej napľuješ do tváre? - Odkopne ti rebrík.', 75, 3.5, 23),
	(5226, 'Počas návštevy v blázinci sa pýta návštevník riaditeľa, podľa akých kritérií sa rozhoduje, či niekto bude zavretý alebo nie.\r\nRiaditeľ vysvetľuje:\r\nNo, my napustíme vaňu vodou, dáme kandidátovi lyžičku, hrnček a kýbeľ a poprosíme ho, aby vaňu vyprázdnili.\r\nNávštevník hovorí:\r\n- Aha, rozumiem, normálny človek vezme kýbeľ, aby to išlo rýchlejšie, že?\r\nRiaditeľ: - Nie, normálny človek vytiahne špunt vo vani. Chcete izbu s balkónom alebo bez?', 488, 3.15, 23),
	(5227, 'Ide Janko do lesa a vidí na strome babku a prihovorí sa jej: "Redbul, redbul?""Nie, pitbul, pitbul."', 102, 3.5, 23),
