	(5232, 'Deti nosia pyžamá so Supermanom, len Superman nosí pyžamo s Chuckom Norrisom.\r\n\nOdkedy Chuck Norris načúral Shumacherovi do nádrže, vyhráva jeden pretek za druhým.\r\n\nChuck Norris je jediný človek, ktorý vie deliť nulou.\r\n\nV skutočnosti to bol Chuck Norris, kto porazil Saurona.', 292, 3.27, 23),
	(5233, 'Keď vidíš na parkovisku miesto s označením hendikepovaných, neznamená to, že tam parkujú hendikepovaní, ale Chuck Norris, a keď tam zaparkuješ ty si hendikepovaný. \r\n\nSocha slobody vo včerajšom interview povedala, že odmalička chcela byť ako Chuck Norris. \r\n\nKeď mali deti v škole opísať smelosť, tak Chuck Norris dostal 1* už po prečítaní mena.\r\n\nChuck Norris napočítal do nekonečna. A to 2-krát!!!\r\n\nChuck Norris zničil periodickú tabuľku prvkov, pretože uznáva len prvok prekvapenia.\r\n\nChuck Norris je prvý človek, čo porazil v tenise betónovú stenu.\r\nChuck Norris zomrel pred 10 rokmi, ale Smrtka nemala odvahu mu to povedať.\r\n\nChuck Norris musí triediť prádlo na tri hromady - biele, farebné a krvavé.\r\n\nChuck Norris je častým darcom krvi pre Červený Kríž. Len nie svojej vlastnej. \r\n\nChuck Norris hral ruskú ruletu s plno nabitou zbraňou a vyhral. \r\n\nKeď Chuck Norris spadne do vody, nebude mokrý, ale voda bude Chuck Norrisová.\r\n\nTeória evolúcie neexistuje, existuje iba zoznam živočíšnych druhov, ktoré nechal Chuck Norris prežiť.', 1105, 3.68, 23),
	(5234, 'Je mi ľúto že som ťa musel opustiť. Tvoj EX-rozum.', 55, 3.69, 23),
	(5235, 'Utekajú dve babky po púšti, na jednu padne telefónna búdka a druhá zakopne o predlžovačku.', 98, 3.18, 23),
