	(5293, 'V škole dostali deti úlohu napísať niečo  o zime.\r\nMalý Móricko napísal: Padá sneh, padá sneh, ja ho je*em nech!', 122, 3.17, 23),
	(5294, 'Sedí cigáň na chodníku a vedľa neho je kopa hovien. Ide okolo skinhead a hovorí: "Čo je? Rozpustil sa ti kamoš?"', 120, 4.08, 23),
