	(5300, 'Príde chlapík do reštaurácie a pýta si víno.\r\nČašník sa ho pýta: A aké víno chcete? Biele alebo červené?\r\nMne je to jedno, ja som farboslepý.\r\n', 158, 3.92, 23),
	(5301, 'Ide cigáň po ulici s veľkou plazmou a stretne Rytmusa.\r\n"Si zabil.\r\nA cigáň mu hovorí: "Si nezamkol!"\r\n', 109, 3.91, 23),
	(5302, 'Ježiš vie chodiť po vode a Chuck Norris vie plávať po zemi.', 64, 3.63, 23),
