	(5304, 'Idú dve stíhačky a jedna nestíha.', 37, 3.43, 23),
	(5305, 'Dve blondínky sú v lese a jedna hovorí druhej: Vidíš, žiadny strom.\r\nA druhá jej odpovedá: Tak zoberme nejaký bez ozdôb.', 130, 3.16, 23),
	(5306, 'Príde pacient k doktorovi a hovorí mu: Mám chorobu, že strácam chuť a zabúdam.\r\nDoktor mu vraví: Tak mi podajte tú hnedú guličku na poličke. \r\nPacient ide k poličke a hovorí: Fuj, veď to je hovno.\r\nA doktor mu hovorí: No, chuť sa vám už vrátila a na toto tiež tak skoro nezabudnete.\r\n', 305, 3.73, 23),
	(5307, 'Viete aká je to žena ne zahriatie?\r\nAk ju uvidíš, hneď si radšej teplý.', 78, 3.56, 23),
	(5308, 'Samopal sa skladá zo štyroch častí. Sú to tieto tri - pažba a hlaveň.', 76, 3.34, 23),
	(5309, '- Viete ako sa hovorí cigáňovi v obleku?\r\n- Obžalovaný vstaňte.', 69, 3.59, 23),
	(5310, 'Donedávna sa vedelo, že mestský policajti majú 1% mozgu. Nedávno sa však zistilo, že to 1% je šiltovka.', 111, 3.45, 23),
	(5311, 'Láska na prvý pohľad? Znie to síce romanticky, ale to sa iba stretnú dvaja nadržaní a nie\r\nveľmi prieberčiví ľudia.', 126, 3.22, 24),
	(5312, 'Moja manželka si má mýli s antibiotikami chce ma každých 6 hodín.', 71, 3.35, 24),
	(5313, 'Rano nejem, lebo ťa milujem. \r\nNa obed nejem, lebo ťa milujem. \r\nVečer tiež nejem, lebo ťa milujem.\r\nA v noci nespím, lebo som hladný.', 141, 3.76, 24),
	(5314, 'Večer, príjemné počasie. Večerné šero pomaly prikríva riedky lesík. Po lesíku sa prechádza naša dvojica. Janko a Marienka. \r\nOdrazu sa Marienka oprie o strom a nežným hláskom sa prihovorí Jankovi:\r\n"Janko, zamakaj si."\r\nA Janko vyrúbal celý les.', 263, 3.33, 24),
	(5315, 'Na špiritistickej seanse:\r\nŽena volá muža na druhom svete: \r\n- Počuješ má miláčik, počuješ ???\r\nMuž: \r\n- Áno počujem ta !\r\nŽena: \r\n- Máš sa tam lepšie ako u mňa ?\r\nMuž: \r\n- Áno mám !\r\nŽena: \r\n- A ako je tam hore v nebi ?\r\nMuž: \r\n- Neviem, som v pekle.', 275, 3.36, 24),
	(5316, '-Marienka, strč ruku do mojich nohavíc - vraví Janko Marienke.\r\nMarienka tak aj urobila.\r\n-Marienka, cítiš to?\r\n-Áno\r\n-Je to ale veľké, že?\r\n-Uhm...\r\n-Je to ale teplé, že Marienka?\r\n-Aha...\r\n-Je to tvrdé, že ?\r\n-Áno.\r\n-No vidíš Marienka, to som všetko vykakal pre teba....', 289, 3.8, 24),
	(5317, 'Príde Fero za otcom a hovorí mu: \r\n- Otec, budem sa ženiť!\r\n- A koho si chceš vziať?\r\n- Joža.\r\n- Joža?! Toho komunistu?!', 128, 3.37, 24),
	(5318, '- Vydám sa iba za muža, ktorý má veľmi známe meno!\r\n- Vydajte sa za mňa, volám sa Novák.', 97, 3.11, 24),
	(5319, 'Matka sa vyzvedá od dcéry, aby jej niečo prezradila o jej novom priateľovi. \r\n- Je slušný a poriadny? \r\n- Ó veľmi. Je proste úžasný. Nepije, nefajči, má super auto a vilu, milú ženu a tri rozkošné deti.', 219, 3.25, 24),
	(5320, '- Bolí ma uško. - sťažuje si dievča na lavičke v parku mladíkovi. Ten ju na ucho pobozká a pýta sa: \r\n- Ešte bolí?\r\n- Ani trošku!\r\nPo chvílke ju bolí za krkom. Mladík ju tam pobozká a pýta sa: \r\n- Ešte bolí?\r\n- Už nie!\r\nNa vedľajšej lavičke sedí starší pán, nakloní sa k mladíkovi a pýta sa ho: \r\n- Prepáčte, hemoroidy tiež liečite?', 366, 3.51, 24),
	(5321, '- Miláčik, je to pravda, že holuby sú najsprostejšie vtáky?\r\n- Áno, holubička moja.', 91, 3.47, 24),
	(5322, 'Na začiatku roka si Pán Boh musel vypočuť mnohé prosby, želania a modlitby. Jedna z nich bola aj \'Modlitba žien\'.\n\r\nPane, daj mi múdrosť, aby som pochopila muža,\r\ndaj mi lásku, aby som mu odpustila,\r\ndaj mi trpezlivosť na jeho nálady,\r\nlen mi nedaj silu, lebo ho zabijem.', 284, 3.29, 24),
	(5323, 'Viete, ako sa matematicky vyjadrí nevera? \r\nHop na druhú!', 59, 3.65, 24),
	(5324, 'Prečo sú spermie v spermobanke také drahé?\r\nLebo je to ručná práca!', 74, 3.41, 24),
	(5325, 'Snúbenec hovorí snúbenici:\r\n- Dnes si spravíme pekný večer. Kúpil som tri lístky do divadla.\r\n- Prečo tri? - pýta sa snúbenica.\r\n- No predsa tvojemu otcovi, mame a bratovi. ', 184, 3.43, 24),
	(5326, 'Tepla letná noc, mesiac svieti na oblohe, keď sa zrazu ozve z kríkov dievčenský hlas.\r\n- Miláčik, komáre pichajú ako divé, nechceš aj ty?', 148, 3.48, 24),
	(5327, 'Stretnú sa dvaja kamaráti a jeden hovorí druhému:\r\n- Moja žena je anjel. \r\nDruhý odpovedá:\r\n- To máš ale šťastie, moja ešte žije.', 142, 3.59, 24),
	(5328, '- Anička, kde bývaš?\r\n- To by si nenašiel.', 46, 2.76, 24),
	(5329, '- Slečna, som prvý, kto vás požiadal o bozk?\r\n- Áno.\r\n- Vy ste taká nevinná...\r\n- A vy trúba.Žiadny sa predom nepýtal.', 128, 3.26, 24),
	(5330, 'Príde muž-BUDÍK večer domov a počuje, že jeho žena je v spálni s iným mužom-BUDÍKOM. Vojde do spálne a začne muža hľadať. Nájde ho v skrini a hovorí mu: \r\n- Tak ty tak ty tak tik...', 199, 3.76, 24),
	(5331, 'Štrnástka sa pýta mamy:\r\n- Naozaj sa rodia deti tade, kam sa dostane sperma?\r\nŠokovaná matka nasucho prehltne ale pedagogicky vysvetľuje:\r\n- Áno dcérenka, to je pravda.\r\n- A to ako? To mi to dieťatko všetky zuby povyráža, či čo?', 242, 3.45, 24),
	(5332, 'Móricko balí učiteľku, tá mu hovorí:\r\n- Vieš, že nemám rada deti.\r\n- Dám si pozor, pani učiteľka.', 109, 3.45, 24),
	(5333, 'Čo je to láska na prvý pohľad?\r\nKeď sa stretnú dvaja nadržaní, nie práve prieberčiví ľudia.', 103, 4.21, 24),
	(5334, '- Keď chceš ženu chytiť za ruku, podaruj jej ružu. Ak ju chceš pobozkať, tak narcis. \r\n- Hmm...dobre, dobre. Tak jej teda kúpim kaktus.', 143, 3.26, 24),
	(5335, 'Fero s Ančov sú na  diskotéke. Fero sa pýta Anči.\r\n- Anča, poď tancovať.\r\n- A ja nejdem.\r\n- Anča pod tancovať, dám ti ružu.\r\n- A ja nejdem.\r\n- Anča, ty krava sprostá, poď tancovať.\r\n- A keď tak pekne prosíš.', 226, 3.28, 24),
	(5336, 'Ako Stevie Wonder spoznal svoju ženu?\r\nBola to láska na prvý pohľad.', 72, 3.12, 24),
	(5337, 'Čo je to hovädzia láska?\r\nKeď je chlap nadržaný ako býk, čaká ako vôl a tá krava nepríde.', 101, 3.54, 24),
	(5338, 'Sedia večer dvaja zamilovaní (ona atlétka - šprintérka) v parku na lavičke. On pri bozkávaní jej rukami zájde pod tričko. Po chvíli sa zarazí a spýta sa:\r\n- Máš husaciu kožu. Je ti zima?\r\n- Nie, to sú prsia.', 224, 3.33, 24),
	(5339, 'Mladý muž sa pýta:\r\n- Slečna mám u vás šancu?\r\n- Áno ste druhý v poradí.\r\n- A kto je prvý?\r\n- Hocikto iný - odpovedá s úsmevom mladá dáma.', 154, 3.31, 24),
	(5340, 'Zalamuje matka rukami nad dospievajúcou dcérou:\r\n- Kde si bola tak dlho? Okamžite vyzliecť a do postele!\r\n- Už zase?', 121, 3.75, 24),
	(5341, 'Po svadobnej noci mladomanželka sedí na posteli a ťažko si vzdychá:\r\n- Ach pane bože, keď i plat budze taký malý, a to budze život!', 141, 3.22, 24),
	(5342, 'Deti na zadných sedadlách spôsobujú nehody.\r\nNehody na zadných sedadlách spôsobujú deti.', 96, 3.3, 24),
	(5343, 'Dedko vracia v drogérii kondómy.\r\n- Čo dedo, sú deravé?\r\n- Deravé nie, ohýbajú sa.', 90, 3.42, 24),
	(5344, 'Stretli sa traja chlapi v krčme. Jeden hovorí:\r\n- Moja žena ma podvádza s futbalistom, vždy keď prídem domov, má pod posteľou futbalovú loptu. \r\nDruhý: \r\n- Moja žena zase s hokejistom. Vždy keď prídem domov, má pod posteľou hokejku. \r\nTretí: \r\n- Moja žena ma podvádza s koňom. Vždy má pod posteľou džokeja.', 331, 3.75, 24),
	(5345, 'On a ona po vášnivej noci:\r\n- Miluješ ma veľmi?\r\n- Milujem ťa veľmi.\r\n- Splníš mi každé moje prianie?\r\n- Áno, splním ti každé tvoje prianie.\r\n- Tak ma zajtra nevyvolaj z matiky.', 191, 4, 24),
	(5346, 'Na diskotéke sa jednému chlapíkovi zapáči dievča. Riadna kosť. Tak sa odhodlá ísť za ňou a chce sa jej prihovoriť, aLe v tom dievča odíde na WC. Chlapík celý nažhavený čaká pred WC a rozmýšľa, čo jej povie. Vtom dievča vyjde a chlapík celý bez seba vypustí:\r\n- Čau, srala si?', 304, 3.72, 24),
	(5347, '- Drahá, pobozkajme sa!\r\n- Ty blázniš, tu na ulici? Niekto nás uvidí!\r\n- Ale kdeže, neuvidí. Toto je slepá ulica.', 121, 2.99, 24),
	(5348, 'O polnoci sa na rodinnom dome rozletia dvere a rozospatý Horák zreve: \r\n- Zuza! \r\nDcéra sa vytrhne milencovi z objatia a pýta sa: \r\n- Čo je otecko? \r\n- Povedz tomu blbcovi, nech ťa neopiera o zvonček!', 207, 3.35, 24),
	(5349, 'Janko s Marienkou idú po lesíku. Jankovi sa chce hrozné moc cikať, ale nevie ako to má Marienke povedať, aby nebol trapný, tak povie:\r\n- Marienka, počkaj ma tu, ja ti idem tamto za stromčeky natrhať kvietky. \r\n- Dobre Janko, ja sa tu zatiaľ vyseriem.', 261, 4.1, 24),
	(5350, 'Svadobná noc. Zrazu sa ozve z izby novomanželov hlas ženícha:\r\n- Mamááá, Anča stále rozťahuje nohy a ja si nemám kam ľahnúť!', 138, 3.39, 24),
	(5351, 'Sedia Rómeo a Júlia a húlia trávu. I riekol Rómeo:\r\n- Júlia, ja ťa strašne milujem. \r\nI riekla Júlia: \r\n- Aj ja k tebe cítim akúsi haluz, Rómeo!', 156, 3.4, 24),
	(5352, 'ADAM:\r\n- Miluješ ma?\r\nEVA:\r\n- A mám na výber?', 48, 3.16, 24),
	(5353, '- Keď sa na mňa usmievate, mám sto chutí vás pozvať ku mne.\r\n- Óóó, vy lichotník.\r\n- Žiadny lichotník, zubár.', 122, 3.47, 24),
	(5354, 'Veci, ktoré by sa nemali hovoriť, ak vám niekto vyzná lásku:\r\n- To som už niekde počul.\r\n- Haha, to je dobré.\r\n- No zbohom!\r\n- Zaujímavé. \r\n- Vieš to aj krajšie.\r\n- No to určite!\r\n- Rozchádzam sa.\r\n- Neotravuj!\r\n- Hm, dobre vedieť.\r\n- No a?\r\n- A vy ste kto?', 272, 3.21, 24),
	(5355, 'Láska hory prenáša, ale hlúposťou ani nehne.', 49, 3.77, 24),
	(5356, 'Po milostnom akte ležia obaja milenci vedľa seba, muž sa pomaly zdvíha a obzerá sa po spálni. Na nočnom stolíku si všimne fotku sympatického chlapa. Pýta sa ženy:\r\n- To je tvoj manžel?\r\n- Nemám manžela.\r\n- Tak tvoj priateľ?\r\n- Nemám priateľa. To som ja pred operáciou.', 287, 3.83, 24),
	(5357, '- Mami, myslím, že sa s Jožom rozídem. Včera sme boli v kine a on sa díval stále len na film!', 100, 3.37, 24),
	(5358, 'Otec karhá svojho syna:\r\n- Namiesto toho, aby si sa venoval štúdiu, beháš za babami!\r\n- Ale ocko, to je trochu inak...\r\n- Žiadne ale! Kto je tu otec, ty alebo ja?!\r\n- Obaja, otec, obaja...', 194, 3.49, 24),
	(5359, '- Miláčik, kým sa spolu zosobášime, musíš mi ešte sľúbiť, že ma budeš bozkávať na miestach, kde ma ešte nikto predtým nebozkával. \r\n- Dobre láska moja, ktoré sú to miestočká? \r\n- No... napríklad Kanárske ostrovy, Seychelly a Mauricius...', 262, 3.09, 24),
	(5360, 'Mladík s dievčinou prichádzajú po rande k nemu domov. On vytiahne kľúče od bytu a ona mu hovorí:\r\n- Vieš, ja sa vždy pozerám, ako muž otvára dvere. Podľa toho usudzujem, či sa k sebe hodíme, či nie. Ak muž hrubo vrazí kľúč do dverí, je to hrubý milenec a nehodíme sa k sebe. Ak mu vypadávajú kľúče z rúk a nemôže nájsť kľúčovú dierku, tak je to neskúsený milenec, ani ten nie je pre mňa. A ty, milý môj, ako otváraš dvere?\r\n- Noo... - odvetí mladík - Ja najprv obliznem kľúčovú dierku.', 537, 3.35, 24),
	(5361, ' Hovorí Fero frajerke:\r\n- Marka, daj si tento kúsok torty.\r\n- Ďakujem, Ferko, nechcem! - odmietne Marka.\r\n- Marka! Prosím, ťa daj si kúsok torty.\r\n- Ferko, ja sladké nemôžem, pribrala by som.\r\n- Prosím ťa...\r\n- Naozaj nechcem tortu!\r\n- Žer tú tortu, ty krava! Je v nej prsteň! Chcem ťa požiadať o ruku!', 319, 3.44, 24),
	(5362, 'Jedna pani práve obedovala, keď jej oznámili, že jej zomrel manžel. Ale ona kľudne pokračovala v jedení.\r\n"Nepočujete? Pred chvíľou vám zomrel manžel!"\r\n"Ále počujem. Len počkajte, kým dojem, potom uvidíte, aká som hysterka!"', 244, 3.31, 24),
	(5363, 'Na diskotéke:\r\n- Slečna, idete tancovať?\r\n- Nie. S deckom netancujem.\r\n- Pardon, ja som nevedel, že ste tehotná!', 117, 3.18, 24),
	(5364, 'Muž a žena v posteli:\r\n- Miláčik, mám AIDS.\r\n- Aj ja.\r\n- Ale ja som srandovala.\r\n- Už viac nebudeš!', 106, 3.61, 24),
	(5365, '- Stará, zakry mi nohy a vypni ten televízor!!\r\n- Nemôžem drahý, sme v kine.', 81, 3.66, 24),
	(5366, '- Drahá, kedy sa vezmeme?\r\n- A hovoril si už s mojou mamou?\r\n- Áno, ale aj tak ťa chcem.', 92, 3.16, 24),
	(5367, 'Vraví zaľúbeným hlasom žena mužovi:\r\n- Ach, chcela by som zomrieť v tvojom náručí.\r\n- Neblázni, Eva, čo by som robil s mŕtvolou?', 141, 3.22, 24),
	(5368, 'Chalan s babou sa bozkávajú. Dievča sa pýta:\r\n- Ty máš žuvačku?\r\n- Nie nádchu.  ', 89, 3.28, 24),
	(5369, '- Mal som všetko, dom, auto, lásku krásnej ženy.\r\n- A čo sa stalo?\r\n- Dozvedela sa to moja manželka!', 106, 3.61, 24),
	(5370, 'Chlapec volá svojmu dievčaťu:\r\n- Mariška, príjdi večer ku kostolu za dedinu, ale neber si spodné nohavičky. Musím ti niečo dôležité povedať.', 154, 3.24, 24),
	(5371, 'Starší chlapec volá svojmu dievčaťu:\r\n- Príď dnes večer ku mne.\r\n- Nemôžem, idem s našimi do kostola.\r\n- Ale, vyser sa na kostol! \r\n- A čo som holub?', 161, 3.13, 24),
	(5372, 'Viete čo je bozkávanie?\r\nZbytočné plytvanie slinami, ktoré sa dajú využiť aj múdrejšie. Napríklad pri lepení známky!', 129, 3.07, 24),
	(5373, 'Jeden kvet hovorí druhému:\r\n- Miluješ ma?\r\n- Áno. A ty mňa?\r\n- Tiež.\r\n- No tak kde, dopaže, sú tie včely?', 114, 3.5, 24),
	(5374, 'Milujú sa operná speváčka a dirigent. Speváčka to komentuje.\r\n- Myslela som, že budeš mať väčšiu paličku.\r\nDirigent nato: \r\n- Nevedel som, že budem dirigovať v tak veľkej sále.', 193, 4.02, 24),
	(5375, 'Príde dievča na rande a hovorí:\r\n"Vieš čo, Peter, ja som to včera nedostala!"\r\n"Veď ja som ti nič neposielal!"', 118, 3.52, 24),
	(5376, 'Šepká snúbenec svojej nastávajúcej:\r\n- Drahá, zarábam 50000 korún mesačne. Dokážeš z toho vyžiť?\r\n- Ja áno. Ale z čoho budeš žiť ty?', 151, 3.71, 24),
	(5377, 'Aký je rozdiel medzi sexom a láskou?    \r\nV láske ste až po uši a v sexe až po gule.', 90, 3.75, 24),
	(5378, 'Bubba (B) je na pytačkách a pýta si od jedného otca jeho dcéru, ale otec (O) má podmienku:\r\nO: - Musíš jej kúpiť nový dom.\r\nB: - Bubba ľúbi, Bubba kúpi.\r\nO týždeň príde Bubba zas, ale otec má ďalšiu podmienku:\r\nO: - Musíš jej kúpiť auto.\r\nB: - Bubba ľúbi, Bubba kúpi.\r\nZas príde o týždeň a otec má ďalšiu podmienku:\r\nO: - Musíš ho mať 5-metrového.\r\nB: - Bubba ľúbi, Bubba skráti.', 421, 3.51, 24),
	(5379, 'Príde milenec  na návštevu k svojej milenke a ona mu hovorí: Láska moja jediná, môžeš mi dať dole sukňu, blúzku, podprsenky ba aj nohavičky....len prosím ťa, štipce na prádlo mi nechaj na šnúre...', 215, 3.84, 24),
	(5380, 'Sedia dvaja mladý v parku \r\nona jemu \r\npríď zajtra nik nebude doma\r\nchlapec prišiel a nik nebol doma\r\n', 106, 3.33, 24),
	(5381, 'Dežko kričí na mamu: "Mami, mami, otecko sa nám obesil v pivnici! "Mamka na to: "Preboha!" Dežko: "Prvý apríl,  prvý apríl, na povale.."', 145, 3.94, 24),
	(5382, 'Postarší manželia sedia pri obede. Zrazu sa žena ozve nežným hlasom: -Starký, akosi ma hreje pri srdiečku. Manžel jej na to: -Ty rašpľa stará, veď máš prsník namočený v polievke. ', 197, 3.97, 24),
	(5383, 'V meste je záplava, jeden chlap je na streche, kde pre neho prídu záchranári na lodi a hovoria mu: "Pane, nastúpte si na loď." Muž hovorí: "Nie, mňa zachráni boh."Záchranári prídu neskôr opäť, tentoraz na helikoptére a hovoria mu: "Pane, nastúpte si."Muž odpovie: "Nie, mňa zachráni boh." Muž zomrie.V nebi stretne boha a hovorí mu: "Bože, prečo si ma nezachránil.""Ty hlupák, veď som ti poslal loď a aj helikoptéru."     ', 452, 3.88, 24),
	(5384, 'Ona: Ahoooj!\r\nOn: Nooo konečne!\r\nOna: Chceš, aby som odišla?\r\nOn: Nie, nie, čo ti šibe? Už len tá predstava je hrozná!\r\nOna: Miluješ ma?\r\nOn: Samozrejme, celé dni a noci!\r\nOna: A podviedol si ma už niekedy?\r\nOn: Nie, nikdy, prečo sa tak sprosto pýtaš?\r\nOna: A budeš ma bozkávať?\r\nOn: Jasne, pri každej príležitosti!\r\nOna: A bol by si schopný ma niekedy udrieť?\r\nOn: Si sa zbláznila, veď predsa vieš, aký som!\r\nOna: Môžem ti dôverovať?\r\nOn: Áno.\r\nOna: Miláčik.\r\n\nDialóg pár rokov po svadbe:\r\nPrečítajte si to zdola nahor.', 557, 4.14, 24),
	(5385, 'Na hodine náboženstva.Mníška príde do triedy a hovorí: "Deti, dám vám hádanku. Je to ryšavé a skáče to po stromoch. Čo je to?"Janko sa prihlási a povie: "Veverička, ale keď to hovoríte vy tak to bude asi Ježiš."', 231, 3.9, 24),
	(5386, 'Stretne sa muž s peknou ženou.\r\n(Muž) Mohli by ste sa so mnou pár minút porozprávať?\r\n(Žena) A prečo? \r\n(Muž) Pretože sa mi stratila žena a vždy keď hovorím s nejakou krásavicou,  odniekiaľ sa objaví.', 218, 4.27, 24),
	(5387, 'Inzerát: \r\nVymením muža s dobrým postavením za muža s dobre postaveným.', 78, 3.64, 24),
	(5388, 'Z dopisu: \r\nDrahá, odpusť mi, že som k Tebe minulý týždeň neprišiel, ale bol som piť a nemohol som 2 dni prísť k sebe, natož k tebe...\r\n', 148, 3.14, 24),
	(5389, 'Žena je ako lastúra...Muž do nej vloží smetie a je z toho perla...', 71, 3.83, 24),
	(5390, '- Prečo si zrušil zasnúbenie s Marienkou? Veď ste sa mali v zime brať. \r\n- No, ale rozmyslel som si to, keď som videl s akou silou práši koberce.\r\n', 155, 4.25, 24),
	(5391, '- To, že spal s mojou ženou mi nevadí, ale to, že jej ukázal, že sa to dá aj dvakrát za sebou, tak tým ma riadne naštval.', 131, 3.26, 25),
	(5392, 'Dvaja páni hrajú golf. Jeden z nich odpaľuje loptičku a v strede švihu zbadá v diaľke pohrebný sprievod. Zdvihne loptičku, skloní hlavu a začne sa modliť. Druhý ho pozoruje a dodá.\r\n- To je najdojímavejšie, čo som kedy videl. Vy musíte byť veľmi honosný a milujúci človek.\r\n- To áno, boli sme manželia 25 rokov.', 336, 3.36, 25),
	(5393, 'Dva týždne po svadbe sa matka pýta dcéry, či už bude konečne babka. Dcéra jej však vraví:\r\n- Mamka, keď ja som ešte stále panna, lebo môj muž mi večer len vezme ruku, dá si ju medzi nohy, ja sa mnu tam trochu pohrám o je po všetkom.\r\nMatka si teda zavolá zaťa a pýta sa ho, či on nevie, že je aj niečo iné ako ruka. On jej na to odpovie:\r\n- Ale ja som vás pýtal o jej ruku, a nie o niečo iné.', 422, 3.51, 25),
	(5394, 'Žena sa necíti veľmi dobre a osloví svojho manžela:\r\n"Muž môj, umieram."\r\nOn na to:\r\n"Ticho! Sústreď sa !"', 115, 3.44, 25),
	(5395, '- Kedy si sa zoznámil so svojou ženou?\r\n- Žiaľ, až keď som sa s ňou oženil.', 83, 3.45, 25),
	(5396, 'On a ona v posteli. Zacengá telefón. Ona zdvihne slúchadlo, počúva, potom povie: \r\n- Áno, áno, dobre - a položí. \r\n- Kto to bol? - pýta sa on.\r\n- Ale, iba manžel volal, že príde neskôr domov, lebo hrá s tebou šachy.', 231, 3.62, 25),
	(5397, 'Svadobná noc. Manželka hovorí svojmu mužovi:\r\n"Drahý, musím sa Ti priznať, že pred svadbou som už bola s iným mužom".\r\n"To nič, drahá, aj ja..."', 157, 3.3, 25),
	(5398, 'Príde muž domov a nájde ženu v posteli s milencom. Muž nahnevaný chytí milenca, hodí von oknom a vraví: \r\n- Ak si myslíš, že máš lepšieho vtáka, tak leť!', 170, 3.56, 25),
	(5399, '- Ja to mám so ženou také ťažké. Dá mi otázku, sama si na ňu odpovie a potom mi mesiac vysvetľuje, prečo to tak nemalo byť.', 135, 3.35, 25),
	(5400, 'Otec volá synovi:\r\n- Synu, s mamou sme sa rozhodli, že sa po štyridsiatich rokoch manželstva rozvedieme. Už to nemá zmysel. Prosím ťa, vysvetli to aj svojej sestre. Ja to nedokážem!\r\nSyn okamžite volá sestre a nasleduje bojová porada. O hodinu volá späť otcovi.\r\n- Otec, prosím ťa, zatiaľ nič nepodnikajte. Prídeme aj so sestrou na Veľkú noc! Porozprávame sa.\r\nOtec zloží telefón a hovorí manželke. \r\n- Tak deti predsa len prídu na Veľkú noc. Čo si vymyslíme na Vianoce?', 504, 3.58, 25),
	(5401, '- Drahý, ktoré sliepky sú sprostejšie? Čierne alebo biele?\r\n- Čo ja viem, ty si odfarbená na blond.', 106, 3.87, 25),
	(5402, 'Zrelá žena sa ráno ešte taká rozospatá vystiera pred zrkadlom v spálni. Dlho sa prezerá zo všetkých strán, hodnotí sa. Potom pozrie na spiaceho manžela a škodoradostne riekne:\r\n- Tak ti treba!', 206, 3.38, 25),
	(5403, '- Ja som veľmi rada, že mi manžela vybrali rodičia. Pri pomyslení, že som si takého idiota vybrala sama, by ma porazilo.', 127, 3.88, 25),
	(5404, 'Mladomanželom sa narodí dieťa a babka hovorí: \r\n"Syn môj, nie je Ti divné, že má tmavú pleť, hoci Vy ste s manželkou biely?"\r\n"Ale babka vieš, manželka mala málo mlieka, tak ho pridájala černoška a tak-to mu stmavla pleť."\r\nA babaka na to: \r\n"Syn môj, keď si sa mi Ty narodil, tiež som mala málo mlieka, pridájala som Ťa kravským, ale že bude z teba taký veľký vôl, to som si nikdy nemyslela."', 423, 3.22, 25),
	(5405, 'Manželský rozhovor po svadobnej noci:\r\n- Drahá moja, ako som zistil minulú noc, nebol som prvý.\r\n- Miláčik môj, ja ako som zistila minulú noc, tak ani posledný.', 170, 3.26, 25),
	(5406, 'Manželka sa pýta manžela:\r\n- Videl si už pokrčenú stokorunáčku?\r\n- Videl.\r\n- A pokrčenú tisíckorunáčku?\r\n- Videl.\r\n- A pol milióna?\r\n- Tak pol milióna som ešte nevidel.\r\n- Tak potom choď do garáže a pozri sa na naše nové auto.', 247, 3.34, 25),
	(5407, 'Rodinná dovolenka pri mori. On kričí na svoju drahú polovičku: \r\n- Miláčik, neplávaj pri brehu! Tam nie sú žraloky.', 125, 3.27, 25),
	(5408, 'Dvojica sa vezie po výpadovke už niekoľko kilometrov v úplnej tichosti. Skoršia diskusia aj tak viedla k hádke a žiadna zo strán nechce eskalovat situáciu. Prechádzajú okolo farmy plnej koňov, kôz a svíň. Na to manžel sarkasticky povie: \r\n- Tvoji príbuzní? \r\nA žena na to:\r\n- Áno, svokrovci.', 311, 3.69, 25),
	(5409, 'Manžel přijede ze služební cesty a vidí manželku v novém kožichu, novém kostýmu, nové prsteny, náušnice. Starostlivě krabatí obočí. Manželka opáčí: \r\n"No co? Vyhrála jsem na tiket." \r\nVečer si manželka napouští vanu a vidí jak manžel pobíhá sem a tam s teploměrem a měří s ním vodu ve vaně. \r\n"Proč to děláš?", ptá se ho manželka. \r\n"No, to aby sis neopařila ten tiket.", odpoví manžel.', 431, 3.18, 25),
	(5410, 'Žena má v posteli milenca. Zrazu niekto zvoní. Žena príde k dverám a zistí, že prišiel manžel. Vbehne do spálne a hovorí milencovi aby rýchlo odišiel, že manžel je strašne žiarlivý, že by ho zabil. Muž holý vyskočí z okna. Akurát sa beží maratón a tak sa pridá. Po chvílke sa ho pýta spolubežec:\r\n- Prečo nemáte číslo?\r\n- Viete, je horúco, mohol by som sa zapariť a dostať nejaké vyrážky.\r\nPo 5 minútach sa ho opäť pýta:\r\n- Prečo nemáte ani trenírky?\r\n- Viete je horúco a mohli by sa mi zapariť stehná.\r\nPo 5 minútach sa ho opäť pýta:\r\n- A prečo bežíte bez topánok?\r\n- A viete, je horúco a tie ekzémy.\r\nTak bežia ďalej a opäť sa ho spolubežec pýta:\r\n- A ten prezervatív, to máte načo?\r\n- No viete, až tak horúco zasa nie je.', 797, 3.84, 25),
	(5412, '- Ja mám neskutočne neporiadnu ženu. Prídem napríklad včera domov, zájdem do kuchyne, reku vyštím sa do umývadla a tam kopa špinavého riadu!!', 153, 3.25, 25),
	(5413, '- Chem sa dať rozviesť, pán sudca!\r\n- A čo je motívom, pani?\r\n- Bol mi neverný!\r\n- Ako to viete?\r\n- Zistila som, že naše deti nie sú jeho!', 147, 3.35, 25),
	(5414, 'Umrel Fero. Jeho vdova Mara sa s ním chce ešte raz pozhovárať a tak zorganizuje špiritistickú seansu. Všetko funguje a Mara začína rozhovor so záhrobím: \r\n- Ferko, si to ty? \r\n- Áno Marka, som to ja. \r\n- Ako sa tam máš, Ferko? Čo tam celý čas robíš? \r\n- No... ráno sa nažeriem, pomilujem sa a trochu si ešte pospím. Cez deň väčšinou žeriem, milujem sa a spím. A večer sa tiež najprv nažeriem, pomilujem sa a potom idem späť. Tak je to každý deň. \r\n- Ferko, kam si sa to dostal? Ty si v raji? - žasne Mara. \r\n- Nie, ja som králik na lúke za Malackami.', 590, 3.41, 25),
	(5415, 'Lord a Lady oslavujú svoju zlatú svadbu.\r\n- Spomínaš aké to bolo počas našej svadby? Dali sme voľno všetkým sluhom...\r\nOkamžite uvoľnia celé služobníctvo.\r\n- Potom sme sa vyzliekli donaha....\r\nObaja sa vyzlečú donaha.\r\n- A zapálili sme sviečky v strieborných svietnikoch...\r\nVšetky svietniky sa o chvíľu rozžiaria.\r\n- Potom si urobila dobrú horúcu polievku...\r\nLady neváha a rýchlo ukuchtí polievku a začnú ju jesť\r\n- Oooh, áno, už cítim také zvláštne teplo okolo srdca, rozžiaria sa oči Lady\r\n- To len preto, - skonštatuje Lord - že ti padol ľavý prsník do polievky.', 612, 3.38, 25),
	(5416, 'Pracujúci manžel sa z nenazdajky prišiel naobedovať domov. Potichu vošiel do bytu a chcel prekvapiť manželku. Otvoril dvere na kuchyni a tam uvidel jeho ženu a poštára so stiahnutými nohavicami. \r\n- A toto má čo znamenať? - pýta sa.\r\nZaskočený poštár nevie kam z konopi, keď uvidí na stole koláč a hovorí:\r\n- Keď nezaplatíte inkaso, naštím vám do koláča!', 385, 3.42, 25),
	(5417, 'Mladá Arabka sa vydáva a matka ju poučuje:\r\n- Dávaj si pozor dcérenka. Potom čo sa vydáš, tvoj muž bude okrem prirodzeného aktu po tebe vyžadovať všelijaké čudné veci. No ty si slušne vychovaná a tak mu zakaždým povedz "Nie, nie a nie!"\r\nPo nejakom čase od svadby hovorí Arab mladuche aby vyskúšali aj inú polohu.\r\nOna: "Nie, nie a nie!"\r\nOn trpí čo trpí až nakoniec sa naštve a hovorí:\r\n- Počuj ty krava  a ako chceš, aby sme splodili deti?', 474, 3.5, 25),
	(5418, 'Postarší manželia sedia pri obede. Zrazu sa žena  ozve nežným hlasom: \r\n"Starký, akosi ma hreje pri srdiečku!" \r\nManžel jej na to:\r\n"Ty rašpla stará, veď máš prsník namočený v polievke."', 203, 3.38, 25),
	(5419, 'Bavia sa dvaja priatelia. \r\n- Čo urobíš, ak nachytáš iného muža v posteli so svojou ženou? \r\n- Zmlátim mu psa a zlomím mu bielu palicu.', 145, 3.54, 25),
	(5420, 'Jeden malý chlapček sa vždy pred spaním pozorne modlil. Raz si otecko povedal, že si synovu modlitbu vypočuje. Tak večer počúval za dverami. Synček odrieka otčenáš a potom: "Dobrú noc, tati, dobrú noc, mami, dobrú noc babi, zbohom dedo."\r\nO týždeň dedko umrel a otec si spomenul na divnú modlitbu a veľmi ho to prekvapilo. Preto sa večer zasa zastavil u dverí a počúval: "Dobrú noc, tati, dobrú noc, mami, zbohom babi."\r\nA za týždeň umrela babička. Otcovi sa to už vôbec nepáčilo, a o to viac ho šokovala večerná modlitba: "Dobrú noc, mami, zbohom, tati."\r\nNeváhal, vzal vkladné knižky a išiel si na týždeň užívať zvyšok života. Chodil po baroch, nechal sa doprevádzat ženami až na hotelovú izbu... Po štrnástich dňoch vyvádzania, keď mu už došli peniaze, si uvedomil, že pred týždňom mal umrieť a ešte žije. Išiel teda hneď domov.\r\nHneď u dverí na neho vyrazila žena:\r\n"Ty sviňa ožratá, čo si ty za človeka? Všetko si prepil, ťaháš sa so ženami, sused umrel a ani na pohrebe si mu nebol!', 1072, 3.62, 25),
	(5421, 'Hovorí manželka manželovi:\r\n- Ty už ani nechceš priznať, že si sa zmenil. Si presne taký arogantný, aký si bol, keď sme sa brali.', 140, 2.97, 25),
	(5422, 'Žena  je nahnevaná, že jej manžel sa s ňou aj po 15 rokoch manželstva miluje stále len potme. Raz to už nevydrží a počas aktu lásky náhle zažne svetlo. Aké je však jej prekvapenie, keď zistí, že jej muž jej to robí uhorkou.\r\n"A to je čo? Takto sa so mnou miluješ stále? Počas všetkých tých rokov? Ty prasa, ty zradca..."\r\n"Počkaj, počkaj... Ty mi do zradcov nenadávaj, lebo sa ťa opýtam na otca našich detí!"', 443, 3.45, 25),
	(5423, 'Mladomanželia sa počas prvej noci svojej lásky zabávali až do hlbokého rána. Potom sa on išiel osprchovať, ale zabudol si uterák a zakričal svojej žienke, aby mu ho priniesla. Ona vošla do sprchy a po prvýkrát ho videla postojačky nahého.\r\n"A tá maličká vec je čo?" - ukázala na miesto pod pupkom\r\nOn sa aj zahanbil, ale musí zachrániť situáciu a hovorí:\r\n"No, to je tá vecička, s ktorou sme sa hrali celú noc..."\r\n"Preboha, a to už z nej len toľko zostalo?"', 490, 3.73, 25),
	(5424, '"Prisahám drahý, že nebol u mňa viac ako 5 minút. Len čo vošiel a vyšiel..."', 84, 3.18, 25),
	(5425, 'Manželia sa chystajú na ples. Manželka stojí pred zrkadlom. Zohne sa a spýta sa manžela, či jej vidieť nohavičky. On jej hovorí:\r\n- Nie, ale mala by si ch vziať.', 172, 3.27, 25),
	(5426, 'Ženatý muž sa po ťažkej nehode dostal do kómy. Jeho verná manželka sedela vedľa jeho postele po celý čas jeho bezvedomia. Jedného dňa sa muž prebral k vedomiu a hovorí svojej žene:\r\n- Prisuň sa bližšie k posteli, chcem ti niečo povedať.\r\nŽena sa prisunie a muž spustí:\r\n- Ty si vždy stála pri mne. Vo všetkom zlom, čo sa mi stalo. Keď ma vyhodili z práce, bola si pri mne. Keď mi zkrachovala firma, bola si pri mne. Keď ma postrelili, bola si pri mne. Keď sme stratili dom, bola si pri mne. Keď sa mi začalo rapídne zhoršovať zdravie, bola si pri mne.\r\nVieš čo?\r\n- Neviem, zlatko - milo odvetí žena.\r\n- Myslím, že mi prinášaš smolu.', 679, 3.44, 25),
	(5427, 'Ide manžel do pôrodnice. Manželka mu kýva z okna. Manžel sa pýta: \r\n- Koľko váži? \r\n- 3,5 Kg!\r\n- Aký je vysoký?\r\n- 5O cm!\r\n- Po kom je? \r\n- Toho ty nepoznáš!', 170, 3.32, 25),
	(5428, 'Príde chlap ku doktorovi a vraví mu:\r\n"Mojej žene by som chcel na 20. výročie svadby venovať plastiku, koľko by to stálo?"\r\nDoktor vraví:\r\n"Ukážte mi fotku..."\r\nChlap:\r\n"Ona je strašne škaredá, tu je fotka.."\r\nDoktor na to:\r\n"Fuuuj, tá je odporná, dám Vám zľavu, 100 000 Sk."\r\nChlap:\r\n"OKEJ, prídem za mesiac...."\r\nDoktor ho za 2 mesiace stretne na ulici a vraví:\r\n"A čo, s manželkou už neprídete?"\r\nA chlap na to:\r\n"Ále, už netreba, našiel som špecialistu, ktorý ju za 50 000 odstrelí...."', 521, 3.12, 25),
	(5429, '4 tajomstvá šťastného manželstva: \r\n1. Je dôležité nájsť ženu, ktorá vie variť a upratovať. \r\n2. Je dôležité nájsť ženu, ktorá vie zarobiť peniaze. \r\n3. Je dôležité nájsť ženu, ktorá má rada sex. \r\n4. Je dôležité, aby sa tieto tri ženy nikdy nestretli.', 286, 3.49, 25),
	(5430, 'Postaršia manželka vyvíjajúca enormnú snahu vyzerať mladšie hovorí:\r\n- Drahý, myslíš, že bez podprsenky vyzerám lepšie?\r\nManžel skloní noviny a vraví:\r\n- Áno zlatko, vyrovnalo ti to vrásky na tvári.', 218, 3.31, 25),
	(5431, '- Keď moja žena začne spievať, ja so synom výjdeme na balkón a pes vlezie do búdy.\r\n- A to už prečo? - pýta sa kamarát.\r\n- Aby si susedia nemysleli, že ju mlátim.', 175, 3.24, 25),
	(5432, 'Žena to už nevydrží. Jej manžel večer čo večer robí fušky.\r\n"Už toho mám dosť! Každý večer si nosíš domov robotu a mna celkom zanedbávaš!"\r\n"Ale, miláčik, veď predsa potrebujeme peniaze. A aj iní si nosia domov robotu..."\r\n"Ale nie všetci robia na patológii ako ty..."', 294, 3.46, 25),
	(5433, 'Za éry prvých mobilov si manžel jeden kúpi a rozhodne sa prekvapiť svoju manželku. Keď príde domov, vojde do kúpeľne a z vane zavolá na svoju pevnú linku. Zodvihne manželka a on hovorí:\r\n- Ahoj miláčik.\r\nŽena na to:\r\n- Prepáč chrústik, teraz nemôžem hovoriť, lebo ten starý chuj leží vo vani.', 318, 3.52, 25),
	(5434, 'V nemocnici leží na posteli muž celý zasadrovaný. Sused sa ho pýta: \r\n- Čo sa vám stalo?\r\n- Ale, mal som pracovný úraz.\r\n- Nehovorte, a aký?\r\n- Bývam na desiatom poschodí a minule som sa vrátil neskoro v noci zo služobnej cesty. Aby som nezobudil manželku, potichu som sa vyzliekol a zaľahol ku nej do postele. Keď už sme spali, zrazu niekto zazvonil. Manželka vykríkla: \'Preboha, manžel!\'. Tak som vyskočil von oknom.', 441, 3.36, 25),
	(5435, 'Príde manžel nečakane zo služobnej cesty a vidí na stole horiacu cigaru. Nahnevane zakričí na manželku: \r\n"Odkiaľ je tá cigara?!!"\r\nA zo skrine sa ozve: \r\n"Z Havany ty blbec!!!"', 187, 3.17, 25),
	(5436, 'Manželia večer ležia v posteli. Ona sa mu sťažuje:\r\n- Už tak dlho si mi nič milého a pekného nepovedal. Suseda sa mi chválila, že jej muž ju volá \'ty moja pánbožkova kravička\'.\r\nManžel sa zamyslí a povie: \r\n- Otoč sa a spi, ty krávo nebeská.', 262, 3.21, 25),
	(5437, 'Ide Pedro s manželkou na kobyle, keď v tom kobyla zakopne. \r\nPedro: \r\n"Tak to bolo po prvý raz..."\r\nIdú ďalej a kobyla zakopne zase. \r\nPedro: \r\n"Tak to bolo po druhý raz..." \r\nPo chvíli stará kobyla zase zakopne. \r\nPedro: \r\n"Tak to bolo po tretí raz..." ... a vytiahne búchačku a kobylu zastrelí. Manželka: \r\n"Pedro, ty si úplný dilino, čo si to urobil, ako teraz pôjdeme ďalej, keď je kobyla mŕtva, čo budeme robiť, ty blbec.....?!"\r\nPedro: \r\n"Tak to bolo po prvý raz..."', 495, 3.23, 25),
	(5438, 'Príde žena domov a hovorí mužovi: \r\n- Počuj, vonku je taká tma, že sa bojím, aby ma niekto neznásilnil. \r\n- Neboj, taká tma ešte nikdy nebola.', 153, 3.3, 25),
	(5439, 'Žena píše advokátovi:\r\nVážený JuDr. Ruth, \r\npíšem Vám, aby som sa poradila o mojom probléme. Som už vyše 20 rokov vydatá. Môj manžel je sexuálny maniak. Miluje sa so mnou v tých najnečakanejších príležitostiach. Napr. keď periem, žehlím, alebo varím v kuchyni. Prosím Vás, nemohli by ste mi  po... luzftrfskioj... pojuiugfztdrs...', 359, 3.2, 25),
	(5440, 'Chlapík leží na smrtelnej posteli, vedľa neho manželka. On jej hovorí:\r\n- Pamätáš? Keď som v škole prepadol, to už sme spolu chodili a stála si pri mne. A keď ma vyhodili z prvého zamestnania, to už si bola moja žena a tiež si stála po mojom boku. Potom, keď mi zkrachovala firma, tiež si bola pri mne. Aj keď náš syn začal fetovať, aj keď mi brata prešiel vlak... a aj teraz keď umieram. Vieš, mám taky pocit, že mi nosíš len smolu.', 467, 3.35, 25),
	(5441, '"Janko, vidím, že si si ma nevzal z lásky."\r\n"Vidíš, vidíš, koľkokrát som ti hovoril, aby si sa nepozerala do zrkadla!"', 128, 3.16, 25),
	(5442, 'Príde muž domov a pýta sa ženy: \r\n"Miláčik čo je dnes na večeru?"\r\n"Nič"\r\n"Tak ja si niečo spravím", povie muž a vyskočí z okna....', 145, 3.16, 25),
	(5443, '"Už nemôžem žiť s tebou ani minútu, to sa radšej utopím!", hovorí žena mužovi.\r\n"No to sa Ti ale nikdy nepodarí."\r\n"A prečo?"\r\n"Lebo každá hus vie plávať."', 172, 3.36, 25),
	(5444, 'Príde manžel z práce domov. Vôjde do spálne, potme pomiluje ženu a ide sa najesť do kuchyne. Zrazu tam zbadá svoju ženu. Pýta sa jej, čo tam robí. Ona odpovedá, že čaká naňho s večerou. \r\n"A kto bol v spálni?", pýta sa muž.\r\n"Moja mama." \r\nManžel ide do spálne a vyčíta svokre, že prečo mu nič nepovedala. A ona odpovedá: \r\n"Veď mi sa spolu nebavíme."', 382, 3.42, 25),
	(5445, 'Slerotický manžel sa pýta svoje manželky :\r\n- Prosím ťa, ako sa vola tá kvetina, čo nám rastie pod oknom?\r\n- Ruža.\r\n- Aháá. Ružena nevieš, kde mám ponožky? ', 172, 3.23, 25),
	(5446, 'Fero varuje priateľa:\r\n- Počuj Jano, nebuď blázon! Neber si Evu. Vyspala  sa s ňou celá Detva! \r\n- No a? Veď Detva nie je veľké mesto.', 143, 3.19, 25),
	(5447, 'Okúpaný a osprchovaný muž sa utiera uterákom pred zrkadlom a pýta sa: \r\n- Zrkadielko, zrkadielko, povedz že mi, kto má najväčšieho chuja na svete?\r\n- Ja - ozve sa manželka.', 184, 3.58, 25),
	(5448, 'Muž sedí smutný na lavičke. Uvidí ho kamarát, príde k nemu a pýta sa:\r\n- No čo máš nové? \r\n- Žena má podvádza. \r\n- Ale ja som sa pýtal, čo máš nové.', 168, 2.96, 25),
	(5449, 'Manželia v posteli. Manželka vraví:\r\n- Drahý, ja by som tak strašne chcela mať väčšie prsia, nedáš mi na plastiku? \r\nŠetrný manžel odpovedá: \r\n- Radšej si ich utieraj toaletným papierom, pozri sa, čo ti to urobilo so zadkom.', 242, 3.41, 25),
	(5450, 'Pri piatom výročí sobáša vraví manželka manželovi:\r\n- Musím sa ti k niečomu priznať, drahý, som farboslepá!\r\n- Aj ja sa ti musím k niečomu priznať, drahá, som černoch!', 185, 3.16, 25),
	(5451, 'Manželská hádka. Muž sa hada s manželkou a hovorí jej: \r\n- Ženy nikdy neprežívajú orgazmus tak ako muži!\r\n- Oh, chceš mi povedať, že to čo prežívam pri sexe sú epileptické záchvaty?', 201, 3.2, 25),
	(5452, 'Manžel nachytá nežnú polovičku s iným. Nahnevá sa a ručne - stručne chlapíka vyhadzuje von. Pozoruje to synáčik a podotkne:\r\n- Ocko a tými parohami doňho. ', 169, 3.26, 25),
	(5453, 'Príde chlapík z práce a nájde manželku, ako ju miluje zarastený poplátaný bezdomovec. Zaskočený ostane stáť, manželka si ho všimne a s kľudom mu hovorí: \r\n- Drahý, tento pán prišiel, slušne zaklopal, pozdravil, že vonku je veľká zima, tak či by som mu nedala niečo teplé, čo manžel už nepoužíva.', 326, 3.28, 25),
	(5454, 'Muž príde domov zo služobnej cesty o deň skôr. Pozrie cez kľúčovú dierku na spálni a vidí jeho ženu s dvojmetrovým milencom. Žena sa pýta milenca: \r\n- Čo by si urobil, keby teraz prišiel môj manžel? \r\n- Roztrhal by som ho!\r\nManžel za dverami hovorí:\r\n- Blbec, veď on nevie, že prídem až zajtra!', 319, 3.36, 25),
	(5455, 'Manžel hovorí žene - blondínke:\r\n"Mám dôležitú poradu, nevolaj mi na mobil, iba v najnutnejších prípadoch."\r\nO chvíľu zvoní mobil. Manžel to zdvihne.\r\n"Vieš miláčik, skladám puzzle a nedarí sa mi ich poskladať. Poraď mi. Prosím."\r\n"A je na krabici aj nejaký obrázor?"\r\n"Áno - myška, lyžička a mlieko."\r\n"Ty blbá, veď to sú cornflaky."', 366, 3.64, 25),
	(5456, 'Mladomanželia idú na svadobnú cestu. Ubytujú sa v hoteli. Recepčný sa pýta:\r\n- Na koľkú hodinu si budete želať budenie?\r\nOči mladomanželky sa rozžiaria:\r\n- Na jednu, na tretiu, na piatu a na siedmu. ', 213, 3.08, 25),
	(5457, 'Stretnú sa dvaja duchovia.\r\n- Preboha, stratil som obrúčku!\r\n- No a čo?\r\n- Žena má zabije.', 96, 3.2, 25),
	(5458, 'Po svadbe. Dcéra sa pýta matky, akú nočnú košeľu si má obliecť.\r\n- Obleč si tú s lastovičkami!\r\nRáno sa matka pýta:\r\n- Tak čo, ako sa mu páčila košieľka?\r\n- Ale mami, on hneď hľadal hniezdo!', 211, 3.24, 25),
	(5459, '- Jano, preboha prečo hádžeš ten hasiaci prístroj do hrobu svojej ženy!\r\n- On sa tej bosorke v pekle ešte zíde!', 119, 3.2, 25),
	(5460, 'Pozve manžel manželku na Silvestra do Londýna. Prídu do reštaurácie, podíde k ním čašník, opýta sa: \r\n- Čo si prajete?\r\nManžel povie:\r\n- No predsa vašu špecialitu - steak, dobre prepečený. \r\nČašník naňho udivene pozrie a povie:\r\n- A čo šialená krava?\r\nManžel na to:\r\n- Ona si objedná sama.', 316, 3.43, 25),
	(5461, 'Príde chlapík do nemocnice s odseknutým mužstvom. Lekár sa ho pýta:\r\n- Preboha, čo sa vám stalo ?\r\n- Ale, som povedal žene, žeby na večeru spravila dačo, čo málo stojí.', 183, 3.62, 25),
	(5462, 'Manželský pár spí pokojne doma vo svojej posteli. Zrazu po polnoci niekto zazvoní. Manželka skríkne: \r\n- Ježišmária manžel!\r\nMuž si bez slova natiahne nohavice a vyskočí z balkóna. ', 196, 3.33, 25),
	(5463, 'Žena sa pozrie mužovi do nohavíc. Muž odpovie:\r\n- Malý, ale náš.', 71, 3.26, 25),
	(5464, 'Prečo majú ženy menštruáciu?\r\nLebo keď mužom pijú celý mesiac krv, tak ju raz musia vypustiť.', 103, 3.34, 25),
	(5465, 'Príde muž na spoveď a hovorí farárovi:\r\n- Pán farár, žena sa ma pokúša otráviť. \r\nFarár sa ide porozprávať so ženou. Po troch hodinách sa vráti a hovorí mužovi:\r\n- Radím ti, synu, vezmi si ten jed.', 218, 3.19, 25),
	(5466, '- Miláčik, chcela by som pod stromček dievčatko. \r\n- Čo blázniš?! Veď by mu do očí napadalo ihličie! ', 112, 3.26, 25),
	(5467, 'Manžel sa vráti z poľovačky o niečo skôr a prichytí ženu s milencom. V zápale hnevu schytí pušku a chce ho milencovi odstreliť. Milenec sa rozplače a sľubuje, že už sa viac k žene nepriblíži, nech mu dá manžel ešte šancu. Ten za zamyslí a povie: \r\n- Dobre teda, môžeš si ho rozhojdať.', 312, 3.13, 25),
	(5468, 'Muž sa pýta manželky:\r\n- Prečo mi nepovieš, keď prichádzaš k orgazmu? \r\n- Nechcem ťa vyrušovať v práci.', 115, 3.53, 25),
	(5469, '- Neviem prečo je toľko kriku a strachu okolo šialených kráv. Ja už žijem 32 rokov s jednou a stále som ešte tu!', 121, 3.17, 25),
	(5470, 'Drží nazlostený manžel svokru pod hrdlom a chystá sa ju vyhodiť z 10.poschodia. Príde k oknu a vraví:\r\n"Iný muž by ťa bol už dávno zastrelil alebo obesil ale,ja ťa pustím na slobodu."', 198, 3.35, 25),
	(5471, 'Svadobná noc.\r\n"Drahý Ty si prvý muž s ktorým som sa milovala".\r\n"A to mi chceš povedať, že všetko čo si mi tu predviedla si sa naučila diaľkovo v nejakom kurze?"', 174, 3.42, 25),
	(5472, 'Dvaja novomanželia. Ona: \r\n- Miláčik, poď robiť do spálne nejaké prasačinky!\r\nOn: \r\n- Dobre, oserieme vankúše!', 120, 3.46, 25),
	(5473, 'Stratený manžel\r\n"Tak, vy nám pani Bieliková hovoríte, že sa vám stratil manžel, kým ste nakupovali?"\r\n"Presne tak, pán policajt. Práve sme vyšli z potravín a ja som manželovi povedala: Pozri - pekná kočka."\r\n"No dobre, ale čo bolo ďalej?"\r\n"Nič. Už som ho viacej nevidela."', 294, 3.67, 25),
	(5474, 'Manžel jemne uštipne svoju polovičku do zadku a vraví:\r\n- Keby sme si to nechali spevniť, nepotrebovali by sme elastické nohavičky. \r\nPotom ju uštipne do pŕs a vraví:\r\n- Keby sme si to nechali spevniť, nepotrebovali by sme podprsenku. \r\nV tom ho žena uštipne medzi nohy a vraví:\r\n- Keby sme si to nechali spevniť, nepotrebujeme elektrikára, záhradníka, poštára a ani tvojho brata.', 400, 3.73, 25),
	(5475, 'Mužovi zomrie žena. Po určitom čase príde k jej hrobu. Sadne si, otvorí prvú fľašu piva, vypije ju. Otvorí druhú, vypije aj tú a tak nasleduje aj tretia, štvrtá a piata. Spokojne dopije a hovorí smerom k hrobu:\r\n- No vidíš, stará, a ide to aj bez rečí!', 272, 3.49, 25),
	(5476, 'Manželka hovorí mužovi: \r\n- Ak neprestaneš chlastať, tak ma z teba porazí!\r\n- Sľubuješ, drahá?', 103, 3.69, 25),
	(5477, 'Stará žena leží na smrteľnej posteli a hovorí:\r\n- Muž môj, ak zomriem, tak ma daj spáliť a rozsyp ma po záhrade.\r\nA on na to:\r\n- Čo si šialená? Zafúka vietor a mám ťa zasa v kuchyni!', 199, 3.13, 25),
	(5478, 'Pýta sa manžel manželky:\r\n- Drahá, nechceš ísť do kina?\r\n- Chcem.\r\n- Tak sa obleč a choď!', 98, 3.32, 25),
	(5479, 'Chlapík sa vracia zo služobnej cesty. V spálni nahá manželka, dvere na skrini pootvorené. Chlap zoberie kladivo, otvorí dvere a tam nahý chlapík.\r\n- Ha, sviňa, čo tu robíš?!\r\n- Ja som z dezinfekčného oddelenia a pani manželka si ma objednala, aby som u vás vykynožil mole.\r\n- Táák a prečo si potom holý? - reve manžel.\r\nChlapík sa prekvapene pozrie na seba a s nefalšovaným údivom hovorí:\r\n- To sú ale beštie nenažrané, tie mole. A kedy to stihli??? ', 482, 3.25, 25),
	(5480, 'Ako opíšeme piatimi slovami rodičov po päťdesiatke?\r\nKeď nehundre jeden, hundre druhý.', 93, 3.29, 25),
	(5481, 'Manželský pár je doma a očakáva návštevu. Muž ale stále behá v slipoch, tak mu žena hovorí:\r\n- Prosím ťa obleč sa, čochvíľa je návšteva tu.\r\n- Ja som schválne v slipoch, aby videli, aký som chudý, pretože mi nechceš variť.\r\n- Tak vieš čo, daj si dole aj slipy, aby vedeli, prečo ti nevarím.', 320, 3.15, 25),
	(5482, 'Manželka volá na svojho muža z druhej izby:\r\n- Drahý, ani si nevieš predstaviť, aký krásny dar som ti kúpila k narodeninám.\r\n- Hneď sa naň idem pozrieť.\r\n- Nie, počkaj chvílku, až si ho oblečiem.', 212, 2.76, 25),
	(5483, 'Fero sa pýta Joža, ako spoznal svoju ženu. Jožo vraví:\r\n- Keď som ešte študoval na univerzite, prišla za mnou na izbu s prosbou jedna mladšia študentka. Povedal som jej, nech si sadne a ona si ľahla!', 211, 3.22, 25),
	(5484, 'Mladoženáč sa polroka po svadbe sťažuje kamarátom:\r\n- Keby som to vedel, nikdy by som si nezobral za ženu hádzanárku!\r\n- Prečo?\r\n- Lebo vždy, keď po mne niečo hodí, vždy ma trafí.', 195, 3.39, 25),
	(5485, 'Manžel, pilot, sa nečakane vráti zo služobky a žartovným hlasom z predsiene kričí: \r\n- Tu SI-134. Dovoľte mi pristáť.\r\nZo spálne sa ozve manželka: \r\n- Tu letisko. Urobte ešte jeden okruh, aby IL-62 mohol odletieť.', 228, 3.32, 25),
	(5486, 'Žena hovorí mužovi:\r\n- Skoč do obchodu a kúp šunku a chlieb. \r\n- No pŕŕ... Nakupovanie nie je mužská záležitosť. \r\n- Dobre, tak sa vyzleč, ideme do spálne! \r\n- To už nemôžem ani žartovať? Kde je taška?', 222, 3.49, 25),
	(5487, 'Muž sa pýta ženy:\r\n- Načo si kúpila tie smiešne prezervatívy. \r\nA žena hovorí:\r\n- Keď sa ti to nepodarí, aspoň sa zasmejeme.', 136, 3.26, 25),
	(5488, 'Manželom sa blíži výročie svadby - 30 rokov. Manžel teda premýšľa, čo by tak mohol manželke kúpiť. Rozhodne sa, že se opýta priamo jej, čo by chcela na výročie. Manželka chvíľu premýšľa a nakoniec hovorí: \r\n- Vieš čo? Nekupuj mi nič. Urobíme si krásny večer, budeme mať dobrú večeru. Mohol by si na tú večeru kúpiť slimáky, vyskúšali by sme, ako chutia.\r\nManžel sa teda po obede zoberie a ide do mesta kúpiť tie slimáky. Zoženie ich pomerne skoro a tak sa ide ešte prejsť po meste. Zablúdi až do "uličky lásky". Ako tou uličkou prechádza, neodolá a s jednou ženštinou zájde na izbu. Keď se prebudil, s hrôzou zistil, že už je ráno. Myslí si: \r\n- Čo budem robiť? Večera s manželkou nebola, v noci som nebol doma, ako jej toto vysvetlím?\r\nTak ide domov a stále premýšľa, ako to urobiť. Príde až pred dom, vysype slimáky na zem a zazvoní. Vylezie manželka a manžel hovorí: \r\n- Tak bežte, vy pomalé slimáky, bežte...', 997, 3.23, 25),
	(5489, 'Manžel s manželkou idú do Zoo a zastavia sa pri klietke s orangutánom. Žena "kosť" s perfektnou postavou. Muž hovorí žene:\r\n- Vyzleč sa a daj si dole podprsenku, čo to s ním spraví.\r\nŽena poslúchne muža a orangutan začne za mrežami búchať a trieskať celý nadržaný. Muž znovu hovorí žene:\r\n- Daj si dolu nohavičky, čo to spraví.\r\nŽena ho znovu poslúchne. Orangutan už nevie, čo má robiť v klietke. Búcha, trieska, skáče po klietke. V tom otvorí muž klietku, strčí ženu dnu a povie:\r\n- No a teraz mu povedz, že ťa boli hlava!', 569, 3.45, 25),
	(5490, 'Viete ako spravíte so sliepky pittbula?\r\nNo oženíte sa s ňou.', 65, 3.29, 25),
	(5491, 'Muž prichádza domov s pochmúrnou náladou. Kabát odhadzuje ledabolo, nepozdraví svoju manželku, pripravenú večeru je s nechuťou. Vidiac to všetko jeho žena, snaží sa mu zlepšiť náladu.\r\n- Drahý, som tehotná.\r\n- Bože, ty tiež?', 245, 3.39, 25),
	(5492, 'Chlapík ide popri starej budove a zrazu počuje tenučký hlások:\r\n- Nechoď okolo, budova spadne!\r\nOdstúpi od budovy a takmer súčasne sa budova rúca a len len že ho trosky nezasiahnu. Zamyslel sa, ale pokračoval v ceste k rieke, tečúcej v hlbokom kaňone. V momente, keď sa chystal prejsť most cez rieku, tak sa opäť ozve slabučký hlások:\r\n- Nechoď cez most! Most spadne!\r\nV momente chlapík ustúpil a most sa s rachotom zrútil dolu. Opýtal sa nahlas:\r\n- Kto si? \r\n- Tvoj anjelik strážny.\r\n- Poď a ukáž sa mi na dlani, nech ťa vidím.\r\nAnjelik tak urobil a zjavil sa na chlapíkovej dlani malý ako náprstok. Na to chlapík dlaň zovrie a začne anjelika silno žmoliť v dlani a rečie:\r\n- Kde si bol ty sviňa, keď som sa ženil?', 761, 3.43, 25),
	(5493, 'Starý, opitý chlap sa nadránom vracia domov z baru s mladou kočkou. V kuchyni ho čaká žena. Mladé dievča nechá stáť na chodbe, príde za ženou a hovorí jej:\r\n- Počúvaj, mám mladú kočku, nebuď sviňa a povedz jej, že si moja sestra.', 252, 3.35, 25),
	(5494, 'Žena hovorí mužovi:\r\n- Jano, vieš prečo sú  holuby sprosté?\r\n- Áno holubička.', 86, 3.37, 25),
	(5495, 'Farmár so ženou sedia večer v posteli. Ona štrikuje a on si číta nejaký odborný časopis. Zrazu zdvihne hlavu a hovorí:\r\n- Tu píšu, že človek je jediný druh, ktorého samice pri milovaní dosahujú orgazmus.\r\nŽena sa na neho zahľadí, iskry v očiach, zvodný úsmev na perách a hovorí:\r\n- Dokáž to!\r\nFarmár sa mierne zamračí, potom povie, že tak teda áno, zodvihne sa a odíde von, zatiaľ čo ona ostane zmätená sedieť na posteli a nevie, čo sa robí. Farmár sa asi za polhodinu unavený a spotený vráti a hovorí:\r\n- No, ani krava ani ovca orgazmus nedosahuje, ale u tej svini neviem. Tá kvičí skoro stále, tak to nerozoznám.', 665, 3.33, 25),
	(5496, 'Píše muž z kúpeľov: Drahá, pošli mi 1000 korún, oni mi to tu predĺžia.\r\nObratom dostane 2000 korún a list: Nech ti to aj rozšíria.', 143, 3.07, 25),
	(5498, 'Príde manželský pár do reštaurácie. Čašníčka pribehne a pýta sa: \r\n- Dáte si niečo? \r\nŽena: \r\n- Párky.\r\nČašníčka: \r\n- Aj chren?\r\nŽena: \r\n- Aj chren si dá párky.', 182, 3.55, 25),
	(5499, 'Stará dievka sa konečne vydala. Prišla hodina pravdy, svadobná noc. Pustia sa do toho, keď sa nevesta ozve:\r\n- Drahý, alebo mi ho tam dáš, alebo ho vytiahneš, ale nepohybuj s ním, lebo ma to hrozne znervózňuje.', 222, 3.16, 25),
	(5500, 'Jano hrá v krčme karty s veľkým sústredením. Tu príde za ním sused a šepká mu do ucha.\r\n- Jano, tam vzadu na humne, na tých doskách, ti dvaja neznámi chlapi ženu          hoblujú.\r\n- No a čo? - vraví Jano - Nech hoblujú. Veď to nie sú moje dosky.', 266, 3.34, 25),
	(5501, '- Ja som raz dokázal myšlienkou rozbiť desať tanierov.\r\n- To kecáš!\r\n- Skutočne. Povedal som manželke, čo si o nej myslím.', 132, 3.07, 25),
	(5502, 'Dvaja kamaráti sa rozprávajú pri pive:\r\n- Dnes nasadím parohy aspoň desiatim chlapom!\r\n- To chceš za jeden deň zbaliť desať ženských?\r\n- To nie, ale dnes sa vyspím s mojou ženou.', 191, 3.2, 25),
	(5503, 'Manželia si kúpia novú skriňu do spálne. Po nejakom čase muž odchádza na služobnú cestu. Manželka si ľahne do postele, zarazu prejde po ulici pod oknom električka a na novej skrini sa otvoria dvere. Manželka okamžite volá výrobcovi, aby poslal opravára, pretože skriňa je pokazená. O dva dni príde opravár a pýta sa:\r\n"Tak, čo sa pokazilo?"\r\n"Viete keď prejde pod oknom električka, otvoria sa dvere na skrini."\r\n"Dobre urobíme to takto: Ja vleziem do skrine, vy ma zatvoríte, počkám kým prejde električka a ja uvidím, kde je závada."\r\nTak aj uroboli. Ale čo čert nechcel, manžel sa vrátil predčasne zo služobnej cesty. Hneď prišiel ku skrini vybaliť si veci. Otvorí ju a v nej ten opravár. Hneď na neho skríkne:\r\n"A vy čo tu robíte?"\r\n"Viete čo, radšej mi hneď jednu streľte, lebo keď Vám poviem, že tu čakám na električku, tak mi neuveríte!"', 903, 3.35, 25),
	(5504, '- Včera jsem se s manželkou strašně pohádal, ale nakonec přilezla na kolenou.\r\n- A co říkala?\r\n- Vylez zpod toho gauče, ty srabe.', 138, 4.16, 25),
	(5505, 'Prečo muž nezažije manželkin orgazmus?\r\nVečšinou pri tom nie je.', 70, 3.31, 25),
	(5506, 'Ako prinútiš manželku, aby kričala, keď sa miluješ?\r\nZatelefonuj jej.', 75, 3.3, 25),
	(5507, 'Synček sa pýta otecka:\r\n- Ocko, prečo si si zobral mamičku?\r\nOtecko sa obráti na mamičku a povie:\r\n- No vidíš, aj ten malý sa tomu čuduje.', 148, 3.37, 25),
	(5508, 'Žena sa v noci zobudí a prebudí svojho manžela:\r\n- Miláčik, chcela by som sa milovať.\r\n- A to ti mám teraz v noci koho zohnať?', 135, 3.13, 25),
	(5509, '- Miláčik, čo to máš na sebe?\r\n- To sú šaty lásky, drahý!\r\n- Ale mohla by si si ich aspoň prežehliť!', 112, 3.08, 25),
	(5510, 'Príde Fero domov a hovorí žene:\r\n- Marka, správaj sa ku mne ako k psovi.\r\n- Ako to myslíš? \r\n- Daj mi nažrať a pusť ma von. ', 133, 3.14, 25),
	(5511, 'Zhovárajú sa dvaja chlapi.\r\n- Keby som sa ti vyspal so ženou, tak by sme boli príbuzní?\r\n- To neviem, ale boli by sme si kvit.', 131, 3.15, 25),
	(5512, '- Drahý, čo sa ti v noci snívalo, keď si ma kopal, pľul a fackal? \r\n- Ja som nespal.', 89, 2.96, 25),
	(5513, 'Pýta sa manželka: \r\n- Kedy prídeš z krčmy?\r\n- Kedy budem chcieť!\r\n- Tak dobre, ale ani o sekundu neskôr!', 111, 3.24, 25),
	(5514, 'V pôrodnici sa pýtajú rodičky: \r\n- Prajete si, aby bol otec pri pôrode?\r\n- Radšej nie, mohol by sa stretnúť s manželom.', 128, 3.02, 25),
	(5515, '- Povedal mi, že ak ho ešte raz podvediem, tak sa zastrelí. Od tých čias mlčím a sedem krát som mu zachránila život.', 126, 2.89, 25),
	(5516, 'Dedko s babkou idú osláviť výročie svadby do reštaurácie. Ako sa babka trápi s rezňom, ten jej vyletí z taniera rovno na blúzku a potom na zem. Babka vraví:\r\n- A teraz vyzerám ako taká sviňa.\r\nDedko zdvihne zrak od taniera a vraví:\r\n- No, a ešte aj blúzku máš zasranú.', 289, 2.95, 25),
	(5517, 'Manželka volá manžela - vegetariána k obedu:\r\n- Drahý, poď obedovať, lebo ti to zvädne!', 95, 3.05, 25),
	(5518, 'Príde nečakane manžel zo služobnej cesty a vidí na stole horiacu cigaru. Naserie sa a kričí na manželku: \r\n- Odkiaľ je tá cigara?\r\nManželka mlčí a tupo zazerá.\r\n- Hovorím, odkiaľ je tá cigara?!\r\nManželka mlčí a zo skrine se ozve:\r\n- Z Havany, ty blbec!', 272, 3.11, 25),
	(5519, 'Príde chlap z fitness centra domov a hovorí žene:\r\n- Všetky svaly ma bolia, ale to je dobre. Keď bolia, znamená to, že rastú.\r\nŽena ho kopne medzi nohy a vraví:\r\n- Tak nech rastie!', 190, 3.42, 25),
	(5520, 'Žena umýva podlahu, muž sedí v kresle a číta si noviny. Žena hovorí:\r\n- Zdvihni si nohy, nech môžem utrieť podlahu.\r\n- To už bez mojej pomoci nevieš ani len podlahu umyť?', 184, 2.99, 25),
	(5521, 'Muž si doviedol domov kamaráta a chváli sa mu.\r\n- Ja mám tak skvelé, na láske založené manželstvo... Sleduj. Marta dones nám pivo!\r\nOna hovorí:\r\n- A čo takto kúzelné slovko?\r\n- Dones nám to pivo, lebo takú ti tresknem...\r\n- Áno miláčik.', 255, 3.19, 25),
	(5522, 'Manželia idú spolu po dlhšom čase na hotel. Ubytujú sa samozrejme do spoločnej izby so \r\nspoločnou posteľou. Ráno chyžná šramotí s kľúčom v zámku, načo si rozospatá manželka povie:\r\n- Do zadku, manžel ide!\r\nNa to sa zobudí jej starý a vyskočí z postele rovno von oknom.', 294, 2.93, 25),
	(5523, 'Zhovára sa manželka s manželom: \r\n- Zapamätaj si, muž môj, v päťdesiatke je žena ako rozprávková postava. \r\n- Máš pravdu, drahá, veď si ako striga.', 162, 2.96, 25),
	(5524, 'Otec ide pre syna do škôlky a keď sa vráti, sťažuje sa žene: \r\n- Eva, náš syn celú cestu domov plakal, prečo? \r\n- No možno preto, že to nie je naš syn.', 165, 3.18, 25),
	(5525, '- Ahoj Jožo, ako žiješ?\r\n- Ale... oženil som sa. A zaujímavé je, že všetci si myslia, že moja žena je Panenka Mária.\r\n- Fakt?\r\n- Ukážem ti fotku.\r\n- Ach, Panenka Mária!', 182, 3.2, 25),
	(5526, 'Starší muž  ráno po prebudení príde k oknu a pozerá na teplomer. Potom vraví: \r\n- Ruženka, dnes si daj teplú podprsenku, je prízemný mrázik. ', 154, 2.85, 25),
	(5527, 'Manželia sa pohádajú až do takého stavu, že spolu nehovoria. Manžel v snahe, že sa všetko udobrí napíše manželke lístoček s textom: \r\n"Miláčik, zobuď ma o šiestej." \r\nManžel vstane o desiatej a celý zhrozený vidí na nočnom stolíku lístoček, na ktorom je: \r\n"Miláčik, vstávaj. Už je šesť!"', 321, 3.32, 25),
	(5528, 'Chlap príde k doktorovi a pýta si lieky pre jeho frigidnú ženu. Doktor mu ich predpíše a manžel večer namieša do nápoja žene štyri pilulky. Pre istotu si dá jednu pilulku aj on. Po vypití mu žena hovorí: \r\n- Miláčik, ja mám strašnú chuť na chlapa.\r\n- Miláčik, ja tiež.', 293, 3.1, 25),
	(5529, 'Muž príde za čarodejníkom a vraví:\r\n- Musíte mi pomôcť a odkliať ma!\r\n- No dobre -  vraví čarodejník - ale predtým mi musíte povedať, ako zneli slová kliatby.\r\nA muž na to:\r\n- Týmto vás vyhlasujem za muža a ženu.', 233, 3, 25),
	(5530, 'Príde muž z dovolenky a hovorí žene:\r\n"Žena ja ťa pomilujem."\r\n"Nemôžeš mám menštruáciu."\r\n"Tak odzadu."\r\n"Nemôžeš, mám hormón."\r\nMuž nahnevane hovorí:\r\n"Ešte mi nepovedz, že ťa bolia zuby!"', 212, 3.97, 25),
	(5531, 'Príde chlap so ženou k plastickému chirurgovi. Po chvíli, keď žena odíde, lekár hovorí manželovi:\r\n"Operácia bude náročná, ale za päťdesiat tisíc vašej manželke úplne prerobím tvár."\r\nChlap sa zamyslí a vraví:\r\n"Vy ste sa museli zblázniť. Radšej ju zavediem k horárovi, ten mi ju za desať tisíc zastrelí!"', 336, 2.78, 25),
	(5532, 'Manžílek dorazil domů nečekaně brzo. Sundal boty, natáhl trepky, koukl\r\ndo ledničky. Nic v ní nenašel, rozhodl se podívat, kde vězí jeho žena,\r\nta mu snad poradí, co na zub. K svému velkému překvapení ji našel v\r\nposteli, rozpálenou, zpocenou.\r\n"Co ti je, proboha,"  vylekal se.\r\n"Snad nejsi nemocná?"\r\n"Nevím, asi srdce... Běž k sousedům a rychle zatelefonuj pro pohotovost..." \r\nMuž vyběhne z ložnice a v předsíni málem zakopne o svého pětiletého syna. Ten ho chytí za nohavici:\r\n"Tatííí, tatííí, nahatej strejda je schovanej ve skříni..."\r\nMuž se zarazí, otevře skříň a tam skutečně sedí jeho nejlepší přítel,\r\ntak jak ho pánbůh stvořil.\r\n"Ty ses asi zbláznil!" vykřikne.\r\n"Manželka má nejspíš infarkt a ty mi tady nahej strašíš děti!"', 807, 3.22, 25),
	(5533, 'Manžel sleduje manželku, ako stále nacvičuje karate a pýta sa:\r\n"Načo toľko cvičíš, čo Ťa to tak strašne baví?"\r\nŽena odpovedá: \r\n"Nie, ale dnes je nebezpečná doba, keď bude tma a pôjdem sama cez park, môže ma niekto prepadnúť a znásilniť."\r\nMuž na ňu pozerá a hovorí:\r\n"Taká tma nikdy nebude..."', 327, 3.1, 25),
	(5534, 'Dežo a Irena ležia v posteli. Irena sa prikloní k Dežovi a takto mu vraví:\r\n- Dežinko, povedz mi "ľúbim  ťa zlatko".\r\n- Ľúbim ťa, zlatko.\r\n- A teraz mi povedz "milujem ťa, poklad môj".\r\n- Milujem ťa, poklad môj.\r\n- A teraz mi povedz niečo sám od seba.\r\n- Spi už ty krava!', 290, 3.36, 25),
	(5535, '- Janko, bozkaj ma.\r\n- Nemôžem !\r\n- Ale Janko veď ma bozkaj !\r\n- Nemôžem, veď vieš, že som ženatý ! A keď tak rozmýšľam, ani milovať by som sa s tebou nemal.', 172, 3.08, 25),
	(5536, 'Večer príde vyhladnutý muž domov a hovorí žene:\r\n- Daj mi večeru!\r\n- A čarovné slovíčko?\r\n- Abraka-dabra.', 116, 3.03, 25),
	(5537, 'Muž príde domov a nájde ženu s cudzím chlapom v posteli. Zoberie ho na balkón a vykopne ho so slovami: \r\n- Keď máš lepšieho vtáka, tak si leť!', 154, 3.17, 25),
	(5538, 'Viete ako sa stane zo sliepky pitbull?\r\nVydá sa!', 49, 2.99, 25),
	(5539, 'Príde muž večer domov a takto sa s manželkou rozprávajú:\r\n"Som hladný, daj mi večeru!"\r\n"A čarovné slovíčko mi nepovieš?"\r\n"... po papuli?"', 152, 3.03, 25),
	(5540, 'Muž so ženou idú do reštaurácie na obed.\r\nAko tak sedia, k mužovi príde atraktívna mladá žena, pobozká ho a\r\npovie:\r\n"O chvíľu sa stretneme" a odíde.\r\nManželka sa pobúrene opýta:\r\n"Kto je to?"\r\n"To je moja milenka."\r\n"Ak je tomu tak, požiadam o rozvod !"\r\n"Ako chceš, ale nebudú už žiadne dovolenky na Maledivách,\r\nnakupovanie v Paríži, ani Mercedes v garáži. Rozhodni sa sama."\r\n"Odrazu uvidia spoločného známeho v sprievode očarujúcej devy.\r\n"To je kto, tá mladá dáma?" pýta sa manželka.\r\n"Jeho milenka" \r\n"Ale tá naša je krajšia".', 573, 3.26, 25),
	(5541, 'Návšteva:\r\n- No servus Fero, dávno som ťa nenavštívil. Ako sa máš, čo robíš a kde je tvoja žena?\r\n- Žena je v pivnici.\r\n- No super, ty si ju tam zamkol?\r\n- Nie, zabetónoval.', 187, 2.8, 25),
	(5542, 'Aj vaša žena pribrala po vianočných sviatkoch pár kilogramov? Treba jej dohovoriť a dohodnúť sa s ňou na dennom behaní 1,5 km. Keď bude takto behať jeden týždeň, tak zistíte, že je od vás vzdialená 10,5 km.', 225, 3.96, 25),
	(5543, 'Muz hovorí žene:\r\n- Ja som sa oženil dobre. Nemožem za to, že ty si sa zle vydala. ', 88, 2.95, 25),
	(5544, 'Žena leží na smrteľnej posteli a hovorí mužovi:\r\n- Drahý, musím ti niečo povedať.\r\n- Drahá, nič nehovor.\r\n- Drahý, bola som ti neverná.\r\n- Drahá, ja viem. Myslíš, že prečo som ti dal ten jed?', 210, 3.05, 25),
	(5545, 'Manželia majú 20. výročie svadby a manželka si chce troch užiť. Hovorí manželovi: \r\n- Miláčik, dnes môžeš robiť čo len chceš. \r\nManžel vstane, ide do kuchyne, zoberie si pivo a ide pred televíziu. Manželku to nahnevá a znovu mu hovorí: \r\n- Miláčik, dnes môžeš robiť čo len chceš. \r\nManžel znovu ide do kuchyne, naleje si pol deci a ide pred televíziu. Manželku to už riadne nahnevá a trochu podráždená hovorí:\r\n- Miláčik, dnes môžeš robiť čo len chceš! \r\nManžel: \r\n- Tu si predo mňa kľakni na kolená. \r\nManželka sa už poteší, vydvihne si sukňu a čaká. Manžel si sadne na ňu a hovorí: \r\n- Hio hio do chladničky, na pol deci borovičky!', 696, 3.63, 25),
	(5546, 'Matka hovorí dcére:\r\n- Keď mi tvoj otec kľačal pri nohách...\r\n- Ja? Nikdy! - bráni sa otec.\r\n- Neprerušuj ma! Povedala som predsa "jej" otec!', 149, 3.06, 25),
	(5547, 'Dcéra príde domov s plačom. Mama sa jej pýta:\r\n- Čo sa ti stalo?\r\n- V škole ma volajú šimapr!\r\n- A to je čo?\r\n- Šialene malé prsia.\r\nV tom sa otec začne strašne smiať. Mama naň kričí:\r\n- Ty buď ticho šimako!', 226, 3.27, 25),
	(5548, '- Kúpil som ti niečo na krk,milá! - hovorí škót svojej žene.\r\n- Náhrdelník?\r\n- Nie.\r\n- Zlatú retiazku?\r\n- Nie.\r\n- A čo je to deda?!\r\n- Mydlo, drahá!', 160, 3.05, 25),
	(5549, '-Chlape, vylezte už konečne z tej telefónnej búdky! Trčíte tam pol hodiny a ešte ste nepovedali ani slovo.\r\n-Prepáčte! Telefonujem s manželkou.', 153, 3.28, 25),
	(5550, 'Muž príde domov a hovorí žene: \r\n- Jáj, takže ty si doma.\r\n- A kde by som podľa teba mala byť?\r\n- Ale som len videl, ako mládež hádže Morenu do potoka tak som si myslel, že by si to mohla byť aj ty.', 212, 2.89, 25),
	(5551, 'Ako sa moderne hovorí vohľadom?\r\nPredmanželský sex!', 55, 2.83, 25),
	(5552, 'Manželský pár sám doma poobede. Beží telka. On číta noviny, ona štrikuje. Zrazu sa ona pohoršene ozve:\r\n"To je morálka. Za bieleho dňa dávajú porno."\r\nOn, zainteresovane zdvihne oči od novín, chvíľku kuká na telku a hovorí:\r\n"Ženská blbá, krátkozraká. Či nevidíš, že to je Fidel Castro, ktorý žerie banán?"', 338, 2.95, 25),
	(5553, 'Jdou manželé do ZOO, zastaví se v pavilonu opic před klecí gorily, kde je napsáno nenahýbejte se přes zábradlí. Samozřejmě zvědavá manželka neuposlechne a v tom ji gorilí samec vtáhne dovnitř a začne ji jaksi sexuálně zneužívat. Manželka volá:\r\n"Pomoc, pomoc, co mám dělat?"\r\nManžel si zapáli cigaretku, spokojeně odfukuje a říká:\r\n"Zkus mu třeba říct, že tě bolí hlava, nebo že jsi unavená."', 433, 3.08, 25),
	(5554, '- Fuj, veď to sa nedá žrať, čo je to?\r\n- To je z konzervy. Bolo tam napísané "pre vášho miláčika".', 109, 2.87, 25),
	(5555, '- Drahá, ty si ako banka. Len s tým rozdielom, že si radšej do teba svoje úspory vkladám ako vyberám.', 108, 2.76, 25),
	(5556, 'Manželka má doma milenca, keď zrazu zvoní niekto u dverí.\r\n"To bude môj manžel!",\r\nhovorí a káže milencovi, aby sa schoval na záchod a robil sa že je opravár. Otvorí dvere a tam druhý milenec. Miluje sa s ním a zase niekto zvoní.\r\n"To bude môj manžel!",\r\nhovorí a druhému káže , aby sa schoval do kúpelne a niečo tam robil. Otvorí dvere a tretí milenec a znovu niekto zvoní.\r\n"To už bude môj manžel!",\r\nale nevie kam ho dá, tak mu povie nech si niečo vymyslí. Vojde manžel, ide na záchod a tam muž.\r\n"Čo tu robíš?"\r\n"Máte pokazený záchod, tak ho opravujem."\r\nDá mu stovku a ide do kúpelne. Tam druhý.\r\n"Čo tu robíš?" \r\n"Máte pokazený vodovod, tak ho opravujem".\r\nDám mu stovku a ide sa prezliecť, otvorí skriňu a z nej vyletí tretí muž a hovorí mu:\r\n"No čo čumíš, ešte si v živote nevidel moľu či čo?"', 869, 3.12, 25),
	(5557, '- Kriste pane.\r\nVzdychá muž po hádke so ženou.\r\n- Bol si tŕňom korunovaný, mučený, ukrižovaný, ale ženatý si nebol.', 128, 2.92, 25),
	(5558, '- Miláčik, musíš si zvýšiť životnú poistku.\r\n- Prečo, zlatko? Veď je dosť vysoká.\r\n- Vieš, keď zomrieš, rada by som smútila na Tahity.', 151, 3.14, 25),
	(5559, 'Príde muž domov zo služobnej cesty a jeho žena má doma troch mužov.\r\nNevie, kde ich má skryť, tak ich napchá do troch vriec a položí ich na balkón. Muž si ide na balkón zapáliť a pýta sa jej, že čo je to tu\r\nza vrecia. Žena hovorí:\r\n- Bola tu svokra a doniesla niečo na jedenie.\r\nMuž buchne po prvom vreci a z vreca sa ozve:\r\n- Kvíík, Kvíík.\r\nMuž si povie:\r\n- Hmm, bravčovina, dobré.\r\nMuž buchne po druhom vreci:\r\n- Múú, Múú.\r\n- Hmm, hovädzina, mňam.\r\nMuž buchne po treťom vreci a ticho. Muž buchne po treťom vreci ešte raz a zase ticho. Tak sa najeduje, chytí lopatu a tresne po vreci. V tom z vreca vybehne muž a nahnevane povie:\r\n- Však keď som ticho, tak som zemiaky.', 717, 3.25, 25),
	(5560, 'Príde manžel z roboty domov a zapozerá sa na svoju manželku:\r\n- Bože, ty si tak strašne škaredá! Tu máš 20 tisíc a choď na plastickú operáciu!\r\nManželka poslušne odíde na chirurgiu. V ordinácii jej chirurg hovorí: \r\n- Viete čo pani zlatá, s vami je to tak zlé, že sa nedá nič urobiť! Ale tu hneď za rohom predávajú plynové masky, choďte si jednu kúpiť.\r\nManželka sa teda vráti v plynovej maske domov a manžel na to:\r\n- Ty si dobrá hus. Ja ti dám 20 tisíc a ty si necháš vytrhať obočie?', 528, 3.13, 25),
	(5561, 'Pani Anežka, bývajúca blízko pri stanici vlakov v panelovej bytovke, si kúpila novú skriňu. Keďže manžel bol na služobnej ceste, poprosila suseda nech jej tú skriňu pomôže namontovať. Postavili skriňu prvý raz. Prešiel okolo vlak, skriňa sa rozsypala. Postavili ju znova. Prešiel vlak, skriňa spadla. Postavili skriňu tretí raz a sused hovorí Anežke: \r\n"Anežka, ja vojdem s baterkou do skrine, počkám kým prejde vlak a budem sledovať, čo povolí." \r\nSused vošiel do skrine. Medzitým sa vrátil manžel. V predsieni pozrie lepšie, vidí cudzie mužské topánky. V spálni - nová skriňa. Pristúpi k nej, otvorí ju a sused zreve:\r\n"Pán sused, rýchlo mi jednu vrazte, lebo mi určite neuveríte, že tu čakám na vlak."', 758, 3.37, 25),
	(5562, '"Dnes som mal prvýkrát po 20 rokoch radosť, že vidím svoju ženu."\r\n"A čo sa stalo?"\r\n"Pozvali ma na identifikáciu."', 123, 3.17, 25),
	(5563, 'Muž sa predčasne vrátil zo služobnej cesty. Po spičkách sa blíži k spálni, priloži ucho na dvere a počuje mužsky šepot:\r\n- Taaak, pekne pomaličky, zlahučka, teraz zdvihnút nôžku, teraz druhú, a ešte zadok, opatrne, aach, už je tam! Prešiel! Ale je to macek! A teraz rýchlo, rýchlo.\r\nTo uz manžel nevydržal, vpálil dnu, rozsvietil, na posteli si pretiera oči rozospatá manželka, okno dokorán.\r\n- Kde je?\r\n- Kto?\r\n- Kto, kto! Milenec, predsa!\r\n- Aký milenec?\r\nŽena prechádza zrakom z manžela na otvorené okno, potom po izbe, potom zase na otvorene okno a zase po izbe.\r\n- Preboha! Kde mame klavír?', 632, 3.28, 25),
	(5564, 'Hovorí blondínka svojmu novopečenému manželovi: \r\n- Drahý, tu polievku som dnes napiekla úplne sama! ', 108, 3.77, 25),
	(5565, 'Žena sa pýta muža:\r\n"Drahý, aké ženy sa ti páčia viac, pekné, alebo múdre?"\r\n"Ani jedny, ani druhé. Veď vieš, že ľúbim len teba!"', 145, 3.25, 25),
	(5566, 'Manželský pár ide okolo výkladu s autami. Manželka hovorí:\r\n- Drahý, na takom krásnom žltom Seate by som aj ja jazdila.\r\nOn jej na to odpovie:\r\n- Drahá, jazdiť môžeš aj na mne a kľudne mi môžeš hovoriť Seat, len opatrne preraďuj rýchlosť.', 260, 2.94, 25),
	(5567, 'Muž leží na smrtelnej posteli. Už si v duchu odrátava čas do "odchodu". Zrazu zacíti omamnú vôňu pagáčikov. Zozbiera posledné sily, doplazí sa do kuchyne a naťahuje sa za jedným pagáčikom. Vtom priskočí žena, tresne ho novinami po ruke a kričí: \r\n- Necháš to! To je na kar!', 298, 3.71, 25),
	(5568, 'Manželia idú večer po cintoríne k hrobke a otvárajú hrob. Staršia pani sa pýta, čo to robia:\r\n"Ale, boli sme večer v kine, tak sme dali deti zatiaľ k našim."', 169, 3.17, 25),
	(5569, '- Boli ste už na štrbskom plese?\r\n- Nie, moja manželka nerada tancuje.', 73, 2.9, 25),
	(5570, 'Viete, prečo muži zarastajú na hrudi?\r\nAby sa kozy mali kde pásť.', 70, 3.01, 25),
	(5571, 'Žena s milencom. Z predsiene počuť, že manžel sa už vrátil.\r\n"Chytro bež na balkón!"\r\nManžel to počuje a hovorí:\r\n"Koľkokrát ti mám opakovať, že nemáme žiaden balkón!"', 187, 2.98, 25),
	(5572, 'Pýta sa žena svojho muža:\r\n- Čo by si urobil, keby ma uniesol cudzí chlap?\r\n- Nikdy by som na teba nezabudol!', 114, 2.98, 25),
	(5573, 'Muž sa vráti skôr domov a nájde svoju ženu so susedom. Spustí na ňu: \r\n- Ty mrcha! A ja som ti zaplatil drahú dovolenku! Kúpil som ti miliónové auto! Postavil som ti obrovský dom! A ty, Fero, prestaň aspoň kým sa s ňou rozprávam!', 246, 3.24, 25),
	(5574, '- Drahá, dnes večer ti priniesiem modré z neba!\r\n- Ja nechcem žiadne modré z neba. Pekne budeš doma sedieť!', 114, 3.44, 25),
	(5575, '"Nazdar! Počul som, že si sa oženil."\r\n"Oženil. Nechutila mi strava v našej závodnej jedálni."\r\n"A pomohlo?"\r\n"Áno, teraz už mi v závodnej jedálni chutí."', 166, 3.01, 25),
	(5576, 'Žena ráno budí muža: \r\n- Starý, vstávaj, sliepky už dávno kotkodákajú! \r\nMuž na to: \r\n- Tak sa im do toho nemiešaj!', 127, 2.91, 25),
	(5577, 'Je nádherná vianočná atmosféra. V domčeku zapadnutom snehom znejú z rozhlasu rolničky, vonia vianočná kapustnica. Pri nádherne ozdobenom stromčeku stojí malý chlapček a vedľa neho jeho mama so zakrvaveným nožom v ruke. Chlapec sa pýta: \r\n- Mami a prečo sa ocko zvíja v kŕčoch na krvavej zemi?\r\n- Nepapuľuj a zaves tie gule na stromček!', 360, 2.54, 25),
	(5578, 'Žena sa ráno zobudila a hovorí mužovi:\r\n"Snívalo sa mi, že na výročie svadby som dostala briliantový náhrdelník. Čo by to mohlo znamenať?"\r\n"Len vydrž, skoro sa to dozvieš."\r\nA naozaj. Na výročie svadby dostala peknú krabičku previazanú mašľou. S trasúcimi rukami ju rozbalila a vnútri knižočka s nadpisom \'Snár\'.', 340, 3.18, 25),
	(5579, '- Moja žena má rada malé deti.\r\n- Moja nie, je vegetariánka!', 64, 3.28, 25),
	(5580, 'Manželka sa zdôveruje po dvoch rokoch manželstva manželovi: - "Miláčik, chcem sa ti zdôveriť, som farboslepá."\r\n"Aj ja sa Ti chcem zdôveriť, som černoch."', 166, 3.47, 25),
	(5581, 'Manželka k manželovi:\r\n"A prestaň sa už zakaždým, keď zašteká Azor, ohlasovať \'Ano, milačik?\' "', 106, 3.48, 25),
	(5582, 'Hovorí žena manželovi:\r\n"Starý, poď sa milovať. Ty na mňa úplne kašleš. Jediné, čo vieš, je zájsť si do chladničky po pivo a na mňa vôbec nemyslíš."\r\n"No tak dobre, ale rozdáme si to na koníčka."\r\n"Ale keď my sme sa už tak dlho nemilovali, že už ani neviem, ako sa to robí."\r\n"To je jednoduché. Postavíš sa na všetky štyri, ja si na teba sadnem a ty ma dovezieš k chladničke, kde si vezmem pivo.', 430, 3.2, 25),
	(5583, '- Miláčik, môžem sa pozerať na televízor?\r\n- Môžeš, ale nezapínaj ho!', 79, 3.06, 25),
	(5584, 'Patológovi prinesú na stôl nový tovar a zistí, že chlapík, ktorého má pitvať, má neuveriteľne veľkého vtáka. Obrovských rozmerov. Keďže je profesionál, nedá mu to pokoja a tak "okrasu" odreže, naloží do formolu a prinesie domov, aby to lepšie preštudoval. Avšak uvidí to jeho manželka a celá zronená zalamuje rukami:\r\n"Tak Novák zo susednej ulice zomrel!"', 386, 3.2, 25),
	(5585, 'Zoberú sa dvaja hluchonemí a už počas prvého týždňa zistia, že musia mať celú noc zapálené svetlo, kvôli posunkom, lebo ináč sa vôbec nedorozumejú. To im však dosť vadí a preto novomanželka posunkami vysvetľuje novomanželovi:\r\n"Keď budeš chcieť sex, chyť ma za pravý prsník a jemne ho stlač. Keď nebudeš chcieť sexovať, chyť ma za ľavý prsník."\r\nOn kýve hlavou, že rozumie a odpovedá:\r\n"O.K. Keď ty budeš chcieť sex, chyť ma za pipíka a raz ho potiahni. Keď sa nebudeš chcieť milovať chyť ma za pipíka a potiahni ho päťdesiatkrát."', 587, 3.46, 25),
	(5586, '- Miláčik, si taká krásna.\r\n- Bohužial, ja nemôžem povedať to isté o tebe.\r\n- Tak to rob ako ja. Jednoducho nehovor pravdu.', 132, 3.08, 25),
	(5587, 'Príde budík domov zo služobnej cesty a nájde budíčku v posteli s druhým budíkom. Postaví sa do dverí a hovorí: \r\n- Tak ty tak tik tak tik tak!', 153, 3.07, 25),
	(5588, 'Pýta sa ráno manželka manžela:\r\n- V noci si ma kopal, bil, pľul si na mňa a sproste si mi nadával. Čo sa ti niečo zlé snívalo?\r\n- Nie, ja som nespal.', 160, 3.39, 25),
	(5589, 'Manžel sa vracia zo služobnej cesty a  žartuje:\r\n- Tu  SI-134. Dovoľte mi pristáť. \r\nZo spálne sa ozve:\r\n- Tu letisko. Urobte okruh, nech môže odletieť IL-62.', 168, 3.15, 25),
	(5590, '15. výročie svadby, manželka skrčená ráno o tretej chodí po kuchyni, manžel sa jej pýta: \r\n- Čo je ti drahá? \r\n- Milovala by som sa.\r\n- Nevieš, kde ti tak skoro ráno niekoho zoženiem?', 197, 3.13, 25),
	(5591, 'Mladá žena prichytí svojho manžela in flagranti s milenkou. Oslepená žiarlivosťou sa rozkričí:\r\n- Dobre mi moja mama hovorila, že ty si z chlapov, ktorí každú ženu hneď zatiahnu do postele... A ty, mama, ty na mňa nečum! Tiež si ma nasrala!', 258, 2.96, 25),
	(5592, 'Muž se ptá manželky: \r\n"Bylas u toho sexuologa? Co ti řekl?" \r\n"Byla... Víš, řekl mi, že to, o čem jsme si mysleli, že je orgasmus, bylo jen astma."', 158, 3.19, 25),
	(5593, '- Miláčik, prečo máš také veľké a dlhé mihalnice? \r\n- Lebo som v mladosti veľa plakal. \r\n- Škoda, mal si radšej viac cikať.', 136, 3.27, 25),
	(5594, 'ON: Už je vnútri?\r\nONA: Ešte nie!\r\nON: To je zaujímavé, lebo ani vonku nie je!', 83, 2.88, 25),
	(5595, 'Ženatý chlapík sa ťahá so svojou sekretárkou. Raz po práci zájde k nej domov a okamžite vlezú do postele. Po vášnivom milovaní zaspia a prebudia sa až o ôsmej večer. Chlapík sa chvatom oblieka a vraví: \r\n- Drahá, vezmi moje topánky a poriadne ich obtri dole o trávnik. \r\nMladá krútila začudovane hlavou, ale poslúchla. Chlapík dorazí domov a už vo dverách na neho žena vykrikuje, kde sa zasa flákal. Chlapík spustí: \r\n- Nemôžem ti klamať. Randím so svojou sekretárkou. Dnes sme skončili skôr, išiel som k nej, strávili sme odpoludnie sexom a zaspali sme. Preto idem neskôr. \r\nŽena sa naňho pozrie, pohľadom skĺzne na jeho topánky a hovorí: \r\n- Pozerám, že máš topánky od trávy. Zasa si bol hrať golf, čo?', 761, 3.74, 25),
	(5596, 'Ráno po svadobnej noci telefonuje dcéra svojej matke:\r\n- Mamička, ty si moje jediné útočište.\r\n- Čo, Gabika, vari ťa bije?\r\n- Nie, ale je hladný.', 155, 2.9, 25),
	(5597, 'Lekár sa pýta slepého. \r\n- Čo ste posledné videli, keď ste prišli o zrak? \r\n- Manželku a vidličku.', 107, 3.15, 25),
	(5598, '- Keď budeš hrať každý večer karty, nájdem si milenca! \r\n- Dobre, drahá, len aby to nebol niekto z našej partie.', 121, 3.26, 25),
	(5599, '- Miláčik, prečo máme čierne dieťa? \r\n- Lebo si kázal zhasnúť svetlo.', 78, 2.58, 25),
	(5600, 'Babka s dedkom sú v obchode - drogérii. Dedko do košíka vloží balíček kondómov. Babka sa poteší, že po dlhej dobe niečo bude. Výjdu z obchodu, dedko hodí balíček na zem, podupe po ňom a hovorí:\r\n- Takto som prestal aj fajčiť!', 246, 3.17, 25),
	(5601, 'Hovorí žena po 20 ročnom manželstve mužovi:\r\n- Urobím z teba najšťastnejšieho muža na svete.\r\nMuž:\r\n- Budeš mi chýbať.', 132, 3.31, 25),
	(5602, 'Prečo musí mať žena po 30-ke pri sexe plynovú masku? Tak:\r\n1. Väčšinou v nej vyzerá lepšie\r\n2. Nemôže veľa kecať\r\n3. Keď jej zapcháš filter, hádže sa ako 20 ročná.', 184, 3.48, 25),
	(5603, 'Žena hreší muža: \r\n- Ty máš radšej futbal ako mňa.\r\n- Áno, súhlasí muž, ale mám ťa radšej ako basketbal.', 119, 2.88, 25),
	(5604, 'Manžel kričí na manželku:\r\n- Prosím ťa, podaj mi tie golfové ponožky.\r\n- Aké? Veď ty žiadne nemáš.\r\n- Ale áno. Tie s tými osemnástimi dierami.', 158, 2.63, 25),
	(5605, 'Jedného dňa sa pozrel dedko na babku a takto nahlas si zavzdychal: \r\n- Mám už skoro sedemdesiatku. Tešil som sa, že sa budem starať o záhradku, o vnukov... a tu zrazu BUM! Vymysleli Viagru.', 197, 2.72, 25),
	(5606, 'Príde manžel z práce domov a nájde plakať svoju ženu, tak sa jej opýta, čo sa jej stalo a ona mu odpovedá:\r\n- Ale, uvarila som ti večeru a kocúr ti ju zjedol.\r\n- Neboj sa, zverolekár ho zachráni.', 208, 3.08, 25),
	(5607, 'Karol sa sťažuje priateľovi: \r\n- To sa už nedá vydržať. Hádame sa so ženou každý deň. \r\n- Možno by pomohol zájazd k moru. \r\n- To nemá význam, ona vie dobre plávať.', 181, 2.92, 25),
	(5608, 'Manžel hovorí manželke:\r\n- Ty si sprostá ako sliepka!\r\nA manželka na to :\r\n- Kto, kto, kto, kto, ja? ', 106, 2.63, 25),
	(5609, 'Príde Jožo z roboty domov a hovorí naradostený svojej žene:\r\n"Anča, vyhral som dva milióny v športke."\r\nNa to mu žena s plačom hovorí:\r\n"Jožo mama mi zomrela."\r\nJožo sa zamyslí a hovorí:\r\n"Sakra, keď lepí tak lepí."', 233, 3, 25),
	(5610, 'Príde žena do rozvodovej kancelárii a pýta sa advokáta, ako sa má rozveisť. Advokát sa pýta:\r\n-A  máte na to dôvod?\r\n- Áno mám, môj muž má polmetrový penis.\r\n- A to ste pred svadbou nevedeli?\r\n- Áno, ale predtým má sním ešte nebil.  ', 255, 3.07, 25),
	(5611, 'Prichádza muž z práce domov a má strašnú chuť zmlátiť ženu, len tak, aby nevyšiel z cviku. Hovorí si:\r\n"Keď mi dá studenú večeru, tak ju zmlátim, že bude modrá." \r\nMuž si sadne za stôl a žena mu dáva pariacu sa večeru pred neho. Pomysli si:\r\n"No nič, to jej vyšlo. Keď mi nedonesie pivo po večeri, tak ju zahluším."\r\nAni nedojedol a chladené pivečko už bolo pred ním. \r\n"Zase jej to vyšlo, no keď sa so mnou nebude chcieť milovať, tak ju zabijem." \r\nVečer v spálni sa žena náruživo na neho vrhne a pomiluje sa s ním. On, celý naštvaný jej vraví:\r\n"Zaštekaj!"\r\nŽena na to:\r\n"Hav-hav-hav."\r\nMuž po nej skočí, začne ju mlátiť hlava-nehlava a kričať:\r\n"Ty budeš brechať na pána?!!"', 738, 2.83, 25),
	(5612, 'Tri manželské páry - dôchodcovia, manželia v strednom veku a novomanželia - prídu za miestnym farárom, že sa rozhodli vstúpiť do cirkvi.\r\n- To je naozaj pekné od vás. Musíte však prejsť skúškou zdržanlivosti, lebo aj naši mučeníci boli ťažko skúšaní. Štyri týždne musíte vydržať bez radostí tela a naučiť sa tak ovládať svojho ducha. Súhlasíte so skúškou?\r\nVšetci sú za a tak o mesiac prídu znova.\r\n- Tak čo, ako to dopadlo?\r\n- U nás nebol žiaden problém - hovorí najstarší pár.\r\n- My sme sa statočne držali, avšak posledný týždeň to bolo hrozné. Manžel spával v kuchyni a ja zamknutá v spálni - zdôverila sa krajšia polovička druhého páru\r\n- A čo vy mladí? Ako ste čelili pokušeniu tela?\r\n- Robili sme čo sa dalo, pán farár. Avšak v predposledný deň manželka chcela zobrať jednu krabicu z najvyššej priečky, nadvihla sa na špičkách, odhalila svoje pekné stehná, krabica jej však spadla, ona sa zohla za ňou, odhalila pritom aj svoj zadoček a viete... toľký pôst, to urobí svoje. Hneď tam na mieste som sa na ňu vrhol a divo ju pomiloval.\r\n- Ach, vy hriešnici! Teraz už istotne viete, že v mojej farnosti nie ste vítaní!\r\n- Áno vieme. A ani v obchode - dodal smutným hlasom mladík.', 1288, 3.44, 25),
	(5613, 'Chlapík odchádza na služobnú cestu, ale hneď pred domom sa mu pokazí auto, tak sa ešte vráti hore a jeho žena tam už má cudzieho chlapa. Začne na ňu kričať a ona hovorí:\r\n- Len mu poriadne vraz, vždy keď odídeš, hneď sa objaví a robí so mnou tieto veci!\r\nManžel sa teda rozbehne a jednu mu vrazí.\r\n- A teraz sa rozbehni a poriadne ho kopni do zadku!\r\nManžel sa teda rozbehne a poriadne ho nakopne.\r\n- Tak, a teraz sa rozbehni a pekne ho naber na parohy!', 479, 3.04, 25),
	(5614, 'Manžel robí v kameňolome a každý deň, keď príde domov, tak hovorí žene:\r\n- Počuj žena, zohrej mi večeru. Keď sa ,najem tak ťa pomilujem a potom idem späť, lebo som unavený.\r\nA takto to ide 20 rokov až to ženu prestane baviť, ide za šéfom kameňolomu, vysvetlí mu situáciu a povie mu, nech mu dá tú najťažšiu robotu. A tak muž príde po takejto fuške domov a hovorí žene:\r\n- Počuj, večeru mi ani nezohrievaj, len ťa pomilujem a idem späť, lebo som strašne unavený.', 504, 2.97, 25),
	(5615, 'Manželka vyčíta manželovi:\r\n- Ja tomu vôbec, ale vôbec nerozumiem. Ako môžeš celú dovolenku presedieť v krčme?\r\n- No vidíš, nerozumieš tomu a predsa do toho kecáš!', 180, 3.12, 25),
	(5616, 'Vyberie sa manželský pár k studni želaní. Najprv pristúpi manžel, niečo si zašomre a odíde. Pristúpi žena, veľmi sa nakloní a spadne do studne. Muž po piatich minútach:\r\n- Ty kokso, ono to funguje.', 213, 3.11, 25),
	(5617, 'Sedí Fero na lavičke, hlavu si drží v dlaniach a narieka: \r\n- Čo je to za život, každý má niekoho, len ja som ženatý.', 128, 3.02, 25),
	(5618, 'Príde muž za čarodejníkom, aby ho zbavil kliatby, pod ktorou je už 40 rokov. Čarodejník mu povie:\r\n- Dobre, ale musíš mi presne povedať slová, ktoré na teba tú kliatbu uvalili.\r\nA muž mu hovorí:\r\n- A teraz vás prehlasujem za muža a ženu.', 255, 4.12, 25),
	(5619, '- Babka, chytro, stojí mi!\r\n- Dedko, počkaj, ešte sa idem vycikať.\r\nO chvíľu dedko: \r\n- No už sa môžeš aj vysrať!', 124, 3.5, 25),
	(5620, 'Ide  žena  s mužom  po  lese a žena   spadne  do  pŕhľavy.   Muž  sa rozbehne  do  najbližšieho  domu.  Žene,  ktorá  mu  otvorila  dvere, hovorí: \r\n- Moja  žena  spadla  do  pŕhľavy!\r\nŽena  mu  na to: \r\n- Nech  sa  páči  mastičky.\r\n- Ja  nechcem  mastičky,  ja  chcem  fotoaparát!', 301, 2.94, 25),
	(5621, 'Jedna  pani  v lese   robí  poplach.  Náhodou   ide  pán   s fotoaparátom   a pani  mu  hovorí: \r\n- Vo  vode  sa  topí  žena!\r\nPán  na  to  odpovie: \r\n- Ľutujem, už  nemám  film.', 189, 2.89, 25),
	(5622, 'Manžel po príchode domov kričí na manželku : \r\n- Rýchlo sa obleč!\r\n- Prečo?\r\n- Vyhral som milión!\r\n- A čo si mám obliecť?\r\n- To je jedno , len už vypadni!', 167, 3.19, 25),
	(5623, 'Manžel hovorí manželke:\r\n- Drahá, mám neskutočnú chuť milovať sa s tebou.\r\n- Ale veď vieš, že mám svoje dni.\r\n- Tak sa so mnou aspoň trošku pohraj.\r\n- Vieš, ale bolí má hlava.\r\n- Aj na to som myslel, posypal som si ho ibuprofenom.', 248, 3.04, 25),
	(5624, 'V posteli šeptá novomanžel:\r\n"Miláčku, nemohl bych v tobě zapálit milostný oheň?"\r\nJeho manželka se místo odpovedi rozesmeje.\r\n"Proč se smeješ?"\r\n"Tou tvou sirčičkou, jo?"', 186, 3.18, 25),
	(5625, 'Manžel:\r\n- Podvádzaš ma,ty cundra!\r\nManželka:\r\n- To nie je pravda.\r\nManžel:\r\n- S taxikárom!\r\nManželka:\r\n- Tak to už vôbec nie je pravda.', 145, 3.14, 25),
	(5626, 'Manžel hovorí manželke:\r\n- Taký som bol sprostý, keď som si ťa bral!\r\n- Vidíš, že platí "Sprostí majú šťastie!"', 126, 3.01, 25),
	(5627, 'Manžel sa vráti predčasne zo služobnej cesty. Manželka má doma milenca. Aby neupadla do manželovho podozrenia, že ho podvádza, ukryje milenca do vreca na balkóne. Manžel pri večeri porozpráva svojej milovanej žene dojmy zo služobnej cesty a po nej si ide zafajčiť na balkón. Tu zbadá tri vrecia. Kopne do prvého a ozve sa „kot, kot, dak.“ Kopne do druhého a ozve sa „me, me.“ Kopne do tretieho a nič. Kopne ešte raz, no opäť nič. Naserie sa a kope do vreca z celej sily. V tom sa ozve:\r\n- Au! Čo toľko kopeš? Keď som ticho, tak som asi zemiaky, nie?', 587, 3.14, 25),
	(5628, 'Manžel podnikateľ sa neskoro večer vráti domov a manželka mu už na chodbe kýva pod nosom vreckovkou:\r\n- Nepatrí náhodou tvojej sekretárke?\r\n- Preboha, kde si ju našla?\r\n- Ja som ju nenašla. Objavil ju sused na nočnom stolíku.', 239, 3.23, 25),
	(5629, 'Muž strašne chrápe a žena to už nemôže vydržať, tak mu pod nos dá olomoucke syrečky. Zaberie to, muž prestane chrápať a aj sa prebudí:\r\n- Anča, spíš?\r\n- Nie nespím.\r\n- Tak sa aspoň prikry!', 208, 3.1, 25),
	(5630, '- Drahý, prečo sa ma už ako kedysi nepýtaš, ako sa mám?\r\n- Drahá, ako sa máš?\r\n- Ach, ani sa nepýtaj!', 111, 3.14, 25),
	(5631, 'Príde muž domov a nájde ženu v posteli s iným mužom. Zoberie pušku a hovorí:\r\n- Postav sa, odstrelím ti gule.\r\nŽena sa ho zastáva:\r\n- Miláčik, daj mu šancu, to je dobrý človek.\r\n- Dobre, može si ich rozhojdať!', 227, 3.33, 25),
	(5632, '- Rozvádzam sa s manželom.\r\n- Prečo?\r\n- Kvôli úprimnosti.\r\n- No a?\r\n- Ja som sa mu priznala, koľko mužov som mala pred ním a on, koľko žien mal po mne.', 161, 2.87, 25),
	(5633, 'Príde chlapík do spovedelnice, že by sa chcel vyspovedať: \r\n- Pán farár, minule sa moja žena nahla cez mrazák a ja som nemohol odolať. \r\nFarár: \r\n- To je v poriadku, medzi manželmi to nie je hriech. \r\nChlapík sa ale aj tak cíti vinný, tak mu farár dá pomodliť sa tri otčenáše. To isté sa opakuje s jeho manželkou. Keď už odchádzajú, pýtajú sa farára:\r\n- Môžeme ešte prísť sem, do kostola?\r\n- Prečo by nie, kedykoľvek.\r\n- Viete, keď do tej sámošky nás už nechcú pustiť.', 511, 3.04, 25),
	(5634, '- Miláčik, miluješ ma? \r\n- A čo si myslíš, že tu robím kliky?', 69, 3.07, 25),
	(5635, '- Miláčik, prosím ťa, môžem sa pozerať na televízor? - pýta sa manžel manželky.\r\n- Môžeš, ale ho nezapínaj!\n', 123, 3.15, 25),
	(5636, 'Manžel manželke:\r\n- Miláčik, chceš ísť do kina?\r\n- Áno, to by bolo super.\r\n- Tak sa obleč a choď.', 107, 2.78, 25),
	(5637, 'Po trojmesačnom manželstve hovorí muž svojej žene: \r\n- Pripomínaš mi moje staré auto. Výkon žiadny, ale tá spotreba!', 127, 3.18, 25),
	(5638, '"Zena choď sa obliecť, idem do krčmy!"\r\n"A čo vari ma chceš zobrať zo  sebou?"\r\n"Nie, idem vypnúť kúrenie."', 116, 3.39, 25),
	(5639, 'Policajti vyšetrujú smrť babky, ktorá sa počas Vianoc zadusila rybacou kosťou. Pýtajú sa dedka:\r\n"Dedko a to ste nevideli, že babka sa dusí?" \r\n"Čóó? Ja slabo počujem." \r\n"Pýtam sa vás, že či ste nevideli, že babka sa dusí?" \r\n"Ja som len videl, že stále otvára ústa a gúľa očami ako kapor, a tak som si myslel, že len spieva koledy..."', 364, 3.25, 25),
	(5640, '- Vieš, akého si zobrala moja kamarátka násilníckeho muža?\r\n- Nie. Akého?\r\n- Počas svadobného tanca zrazu ku nej pribehol a kopol jej do rozkroku...\r\n- A čo, poranil ju? \r\n- Ju nie, ale mne, sviňa, zlomil dva prsty.', 226, 3.02, 25),
	(5641, 'Viete, čo si myslí manželský pár na ich 16 výročie sobáša v posteli?\r\nOna: "Stavím sa, že ma ani dnes vôbec nepomiluje!"\r\nOn: "Keby som ju vtedy bol zavraždil, dnes by ma určite pustili z basy."', 208, 3.2, 25),
	(5642, 'Pýta sa manžel svojej ženy:\r\n- Mám tu suchý chlieb. Mám ho dať von vtákom? \r\n- Preboha len to nie. Radšej to sprav rukami!', 131, 3.24, 25),
	(5643, 'Manželka hovorí manželovi:\r\n- Miláčik, tak ma napadlo, že keď jeden z nás dvoch umrie, odsťahujem sa do Prahy.', 119, 3.15, 25),
	(5644, 'Pýtajú sa pani Kukučkovej či sa chce nechať po smrti spopolniť alebo sa nechá pochovať.\r\n"Čo ja viem, ale asi dám na svojho muža a poslúchnem ho."\r\n"A ten čo hovorí?" \r\n"Ten mi stále hovorí, že sa mám dať vypchať."', 234, 3.14, 25),
	(5645, 'Muž ide zapnúť televízor pred futbalovým zápasom a kričí na manželku, ktorá je v kuchyni: \r\n"Drahá chceš mi ešte niečo povedať, pred začatím futbalovej sezóny???"', 180, 3.39, 25),
	(5646, 'Dora, čerstvá mladomanželka, stretla kamarátku Maru. Tá sa jej pýta:\r\n- Tak ako tvoj nový manžel?\r\n- Čo ti budem hovoriť. Je mladý, krásny, bohatý a navyše aj sexuálny divoch...\r\n- Nevrav!\r\n- Veru, každý deň sa so mnou chce aj desať razy pomilovať!\r\n- Nevrav! A je dobrý v posteli?\r\n- Neviem. Ešte som mu nedala.              ', 348, 4.2, 25),
	(5647, 'Drahý, naše deti sú už veľké. Budeme si musieť dávať trochu pozor a nehovoriť pred nimi otvorene. Začínajú už kadečomu rozumieť a kladú potom nepríjemné otázky.\r\n"Aké napríklad?"\r\n"Napríklad prečo som sa za teba vydala."              ', 258, 3, 25),
	(5648, 'Manželka sa na súde obhajuje:\r\n"Ako som mohla vedieť, že môj manžel je alergický na kyanid?"              ', 113, 3.4, 25),
	(5649, 'Blahoželám ti, chlapče! Som presvedčený, že po rokoch budeš na tento deň spomínať ako na najšťastnejšiu udalosť tvojho života!\r\n"Ale strýko, veď ja sa žením až zajtra."\r\n"Ja viem, práve preto, práve preto!"              ', 242, 4, 25),
	(5650, 'Manželka vyčíta manželovi:\r\n"Ja tomu vôbec, ale vôbec nerozumiem. Ako môžeš celú dovolenku presedieť v krčme?"\r\n"No vidíš, nerozumieš tomu a predsa do toho kecáš!"              ', 194, 3.67, 25),
	(5651, 'Kedy sa končia medové týždne?\r\nKeď manžel prestáva žene pomáhať pri umývaní riadu a začína to robiť sám.\n', 121, 4.09, 25),
	(5652, '- Rozvádzam sa zo ženou.\r\n- Prečo?\r\n- Pije pivo.\r\n- Veď aj ty...\r\n- Veď práve! Kde mám na to brať?              ', 120, 3.76, 25),
	(5653, 'Hovorí manželka manželovi:\r\n- Ty si ako komár. Celý život mi piješ krv, a keď ma picháš, tak by ťa človek zabil!              ', 138, 1.55, 25),
	(5654, '- Prečo sa vždy spiješ do nemoty?\r\n- Aby som žene nemusel doma nič vysvetľovať.              ', 100, 3.67, 25),
	(5655, 'Nahnevaný manžel vraví svojej žene.\r\n- Mala by si sa presťahovať do Indie, tam by ťa vedeli oceniť.\r\n- Ako to myslíš?\r\n- Tam sú kravy posvätné.              ', 170, 4, 25),
	(5656, '"Vonku je tak krásne", hovorí muž manželke,\r\n"a ty sa tu drieš s  parketami! Mala by si ísť na vzduch a umyť auto!"              ', 137, 3.86, 25),
	(5657, 'Muž sa sťažuje lekárovi, že má obrátený krvný obeh.\r\n"Takú chorobu nepoznám. Ako sa to u vás prejavuje?" pýta sa lekár.\r\n"Kedysi, keď ma žena pohladila po vlasoch, postavil sa mi vták. Dnes, keď mi pohladí vtáka, zježia sa mi vlasy."              ', 268, 4, 25),
	(5658, 'My si s manželkou často vymieňame názory.\r\nPrichádzam so svojím názorom a odchádzam s jej.              ', 112, 3.55, 25),
	(5659, '– Pán doktor, prečo môj manžel stále hovorí zo spánku?\r\n– Asi preto, že ho cez deň nepustíte k slovu.\n', 116, 3.71, 25),
	(5660, '"Drahá, nevyjdeme si na kratšiu romantickú prechádzku?"\n"Doparoma, to si si to pivo nemohol kúpiť cestou domov?"              ', 132, 4.07, 25),
	(5661, 'Joj, Dežo, vieš jak ma hreje pri srdci....\n- To je normálne, keď máš ľavú cicku v polievke.              ', 113, 3.78, 25),
	(5662, '- Vraj si sa stal štastným oteckom.\nA pani sa ako má?\n- Našťastie o tom nevie!              ', 97, 4.15, 25),
	(5663, 'Žena se pýta manžela: \n"Videl si niekedy zhužvanú stovku?" \n"Nie," hovorí muž znudeným hlasom. Manželka pred ním pokrčí stovku. \n"A videl si niekedy zhužvanú tisícku?" \n"Nie." \n"Tak sa pozeraj..." a pokrčí pred ním tisícku. Potom sa ho pýta: \n"A videl si niekedy zhužvaných osemsto tisíc?" \nMuž na to nechápavým hlasom: "Nie..." \n"Tak to sa choď pozrieť, stojí \nv garáži."  \n', 406, 3.33, 25),
	(5664, 'Mladá žena v knižnici:\n"Kde nájdem knihu o manželskom šťastí?"\n"Skúste oddelenie rozprávok..."              ', 118, 3.11, 25),
	(5665, 'Modlitba žien\nPane, daj mi múdrosť, aby som pochopila muža,\ndaj mi lásku, aby som mu odpustila,\ndaj mi trpezlivosť na jeho nálady,\nlen mi nedávaj silu, lebo ho zabijem.              ', 190, 4, 25),
	(5666, 'Telefonuje syn s mamou:\n"Mami, môžem dnes prísť aj so svojím dievčaťom?"\n"Samozrejme, synček."\n"Vieš mami, ja som s ňou už dva mesiace ženatý..."\n"Och! To je skvelé, synček."\n"Mami, chceli by sme žiť u vás."\n"Dobre synček, bude nám spolu veselšie."\n"... ale ona je Cigánka..."\n"Synček, veď nie sme žiadni rasisti."\n"... a má štyri deti..."\n"Synček, ja sa už teším na deťúrence."\n"Mami, no vy máte iba jednoizbový byt."\n"To je v poriadku. Ty s manželkou budeš bývať v izbe a otec si ustelie v kuchyni."\n"... a čo ty, mami?"\n"Ja sa idem teraz obesiť..."              ', 606, 3.92, 25),
	(5667, '”Ocko, čo tí dvaja psíčkovia robia?” pýta sa syn otca, ktorý ho v rámci správnej výchovy zobral do prírody.\n”No vieš, sučka nechce ísť domov a psík ju presviedča, aby predsa len šla.”\nSynovi sa rozsvietia očká a hovorí:\n”To je ako s mamičkou. Keby sa nebola dobre držala umývadla, ujo poštár by ju určite odniesol na poštu.”              ', 377, 3.19, 25),
	(5668, 'Manželská hádka:\r\n”Pamätáš sa, ako si mi hovoril, že ma budeš nosiť na rukách?”\r\n”A pamätáš sa, aká si bola štíhla?”              ', 154, 4.26, 25),
	(5669, '”Tak čo?” – vraví manželka manželovi,” kúpiš mi ten diamant, alebo nie?!”\r\n”To je ultimátum?”\r\n”Nie, šperk.”              ', 148, 4.13, 25),
	(5670, '25 výročie manželstva.\r\n”Drahý, čo dostanem ako darček k výročiu?”\r\n”Kúpil som zájazd do Španielska.”\r\nPríjemne prekvapená manželka sa pýta:\r\n”Taký pekný dar, a to len k 25. výročiu! Čo také by si mi asi kúpil, keď budeme mať 50. výročie?\r\n”Pôjdem ťa vyzdvihnúť späť.”               ', 329, 4.17, 25),
	(5671, 'Príde novomanžel domov a novomanželka ho čaká s večerou.\r\n”Hm, fajné plnené kurčiatko, to si pochutím. A čím si ho naplnila, miláčik?”\r\n”Ako to čím? Veď naplnené už bolo!”              ', 212, 3.14, 25),
	(5672, 'Raz takto žena vraví svojmu mužovi:\r\n”Už nemám nič na seba.”\r\nRozhorčený muž otvorí skriňu a vraví:\r\n”Ty, že nemáš čo na seba? Tak sa pozeraj: jedny šaty, druhé šaty, nazdar Karol, tretie šaty.”              ', 236, 4.27, 25),
	(5673, 'Rozprávajú sa dvaja zbožní mladíci pred svadbou jedného z nich:\r\n"Trápim sa, či tá moja nastávajúca je ešte panna. Ona síce vraví, že áno, ale človek nikdy nevie.\r\n"Ale, to pri svadobnej noci ľahko zistíš. Stačí ti lopata a trochu červenej a zelenej farby." radí mu kamarát.\r\n"Čo je to za hlúposť?"\r\n"Žiadna hlúposť! Jedno vajce si zafarbíš na červeno a jedno na zeleno. Keď sa večer vyzlečieš a nevesta ti povie, že také veselé vajcia ešte nevidela, môžeš ju rovno tresnúť tou lopatou."\n', 535, 3, 25),
	(5674, 'Manželka sa sťažuje manželovi, že má malé prsia a že by rada chcela implánty k jej narodeninám. On jej na to hovrí, že najlepšie je používať toaletný papier a denne utierať prsia. Ona na to, že či si robí z nej srandu? Manžel pozrie  vážne na manželku a povie: "Všimol som si, že po použití WC použivaš toaletný papier a ten zadok Ti rastie zo dňa na deň!"              ', 404, 3.97, 25),
	(5675, '"Môj manžel mi denne robí prednášku, ako dobre vedela variť  jeho matka." sťažuje si Mária.\r\n"Môj manžel to robil tiež." mávne rukou Eva.\r\n"A už to nerobí?"\r\n"Nie! Začala som mu rozprávať, ako dobre vedel môj otec zarábať veľké peniaze."              ', 274, 3.63, 25),
	(5676, 'Muž príde domov v neveselej nálade a začne dorážať na manželku. \r\nOna: "Daj pokoj, veď vieš, že dnes nemôžem!"\r\nOn: "To ste sa na mňa dnes všetky dohodli, alebo čo?"              ', 195, 4.2, 25),
	(5677, 'Manžel príde domov, ľahne si k manželke do postele a manželka mu vraví:\r\n"Milujem ťa, miláčik, hrozne ťa milujem"\r\nA vtom sa zo skrine ozve:\r\n"Kecá."              ', 174, 3.33, 25),
	(5678, '"Čo keby sme si urobili pekný víkend?"\r\n"Dobre a čo navrhuješ, drahý?"\r\n"Ja si kúpim prepravku piva a ty môžeš ísť k matke!"              ', 150, 4, 25),
	(5679, 'Príde muž domov o polnoci a začne na neho štekať vlastný pes. Muž vraví:\r\n"Ticho, hlupaňa, zobudí sa manželka - kde zase budeš spať?"              ', 160, 3.43, 25),
	(5680, 'Mladomanželia čakajú na recepcii hotelu. Do haly vstupuje mladá žena a prechádza okolo. \r\n”Čau, drahý!”\r\nBez rozpakov pobozká mladomanžela a ide ďalej.\r\n”Prosím ťa, kto to bol?”\r\n”Daj pokoj! Vieš si predstaviť, koľko sa natrápim, kým jej vysvetlím, kto si ty?”              ', 305, 3.9, 25),
	(5681, 'Manželka stojí pred zrkadlom s fľaštičkou očných kvapiek. Najprv si nakvapká do očí a potom pár kvapiek uštedrí svojej kundičke. Ohromený manžel sa pýta:\r\n”Do očí, to by som ešte chápal, ale prečo aj tam?”\r\nŽena pohotovo odpovie:\r\n”Tá už tiež dlho nič nevidela...”              ', 313, 4.19, 25),
	(5682, 'Žena s mužom sedia za stolom a obedujú. Žena sa obrindá a povie: Do riti teraz vyzerám ako sviňa. A muž jej na to povie: No a ešte si sa aj obrindala.              ', 173, 3.85, 25),
	(5683, 'Žena hreší muža:\r\n”Ty máš futbal radšej ako mňa!”\r\n”Áno,” súhlasí muž, ”ale mám ťa radšej ako basketbal.”              ', 146, 3.79, 25),
	(5684, 'Fero s Mišom sú poľovníci. Hádajú sa, kto má lepšieho poľovníckeho psa. Fero vraví:\r\n”Išiel som raz do lesa a zabudol som si pušku. Dal som oňuchať psovi náboje, on sa rozbehol domov a priniesol mi ju.”\r\nMišo vraví:\r\n”To zase ja som raz išiel so ženou a psom na kúpalisko. Žena si zabudla doma plavky. Tak som dal psovi oňuchať ženin rozkrok a on mi doniesol susedove vajcia.”              ', 423, 3.9, 25),
	(5685, 'Policajt sa pýta ženy:\r\n”Ako to, že vylúpenie bytu idete hlásiť tak neskoro? Čo vám nebol nápadný ten hrozný neporiadok v izbách?”\r\n”Najprv ani nie. Myslela som si, že sa len manžel vrátil pre kravatu.”              ', 239, 4.13, 25),
	(5686, 'Pán Novák príde na policajnú stanicu a požiada, či by sa mohol stretnúť so zadržaným lupičom, ktorý v noci vnikol do ich bytu.\r\n”No dobre, ale nesmiete ho udrieť. Čaká ho súd.” upozorňuje ho policajt.\r\n”Nebojte sa, ja mu nič neurobím. Chcem sa ho len spýtať, ako sa mu podarilo k nám v noci vkĺznuť bez toho, aby prebudil moju ženu.”              ', 380, 4.1, 25),
	(5687, 'Okoupaný a  osprchovaný muž sa utiera ručníkom pred zrkadlom a pýta sa: \r\n"Zrkadlo, zrkadlo, kto má najvätšieho čuráka na svete?"\r\n"Ja", ozve se manželka z izby.               ', 188, 2.33, 25),
	(5688, 'Manžel jemne uštipne svoju polovičku do zadku a vraví:\r\n”Keby sme si to nechali spevniť, nepotrebovali by sme elastické nohavičky.”\r\nPotom ju uštipne do pŕs a vraví:\r\n”Keby sme si to nechali spevniť, nepotrebovali by sme podprsenku.”\r\nV tom ho žena uštipne medzi nohy a vraví:\r\n”Keby sme si toto nechali spevniť, nepotrebovali by sme  elektrikára, záhradníka, poštára a ani tvojho brata.”              ', 434, 4.21, 25),
	(5689, 'Muž sa jedného dňa zahľadí na manželku a vraví:\r\n”Jarmila, myslím si, že by to dneska šlo.”\r\n”A čo ako?”\r\n”No, vonku svieti slniečko, na oblohe ani mráčika...”\r\n”A čo by akože šlo?”\r\n”Hovorila si predsa, že jedného pekného dňa sa zbalíš a pôjdeš...”              ', 308, 3.72, 25),
	(5690, 'V krčme sa postaví opitý chlapík, buchne päsťou po stole a hovorí:\r\n”Dnes prídem domov, kopnem do dverí a žena ani nemukne!”\r\n”A čo ak náhodou mukne? Ha?”\r\n”Nemukne, ráno odcestovala do Bratislavy.”              ', 237, 3.5, 25),
	(5691, 'Sťažuje sa novomanžel Mišo kamarátovi Ferovi:\r\n”Tá moja žena ma k sebe do postele pustí najviac raz za týždeň...”\r\n”No, to si na tom  ešte dobre!” chlácholí ho Fero. ”Poznám niekoľko chlapcov, ktorých tá tvoja potvora pustí k sebe do postele len raz za mesiac.”              ', 306, 4, 25),
	(5692, 'Svadobná noc, dvanásť hodín, ozve sa zašeptanie ženícha:\r\n”Drahá, môžem?”\r\n”Nie!” šepká nevesta odpoveď.\r\nHodiny odbíjajú druhú. Zase prosebný ženíchov hlas:\r\n”Už môžem?”\r\n”Ešte nie.”\r\nŠtyri hodiny:\r\n”A teraz môžem?”\r\n”Ešte stále nie.”\r\nŠesť hodín. Z dvora sa ozýva kikiríkanie. Ženích skoro s plačom:\r\n”No, ale teraz by som už mohol, nie?”\r\n”No tak dobre. Zlez.” dovolí mu nevesta.              ', 466, 4.2, 25),
	(5693, 'Sedia Fero a Mišo na brehu rieky a chytajú ryby. Po chvíli Fero hovorí:\r\n”Počuj, Mišo... ééé... mhmm... ty spávaš s mojou ženou. A to je... ééé... zle!”\r\n”Vieš čo Fero, ja tú vašu rodinu fakt nechápem!” hnevá sa Mišo. ”Tvoja žena hovorí DOBRE, ty hovoríš ZLE. Kto sa má v tom vyznať?”              ', 338, 3, 25),
	(5694, 'Manželka vyčíta manželovi:\r\n”Zase ideš do krčmy? Veď vieš, že máme do dvoch dní zaplatiť nájom!”\r\n”Neboj sa, do tej doby sa určite vrátim!”              ', 176, 3.8, 25),
	(5695, 'Muž príde domov a nájde ženu v posteli s milencom. Skôr ako stihne niečo povedať, nahá žena vyskočí, bije ho a kričí:\r\n”Takto sa chodí z roboty?! Takto skoro?! Ja ti dám ulievať sa z práce!”              ', 225, 3.75, 25),
	(5696, 'Rozprávajú sa dve kamarátky:\r\n”Môj nový priateľ je poriadny kanec! Ja sa zaňho vydám!”\r\nDruhá na to:\r\n”Môj muž bol pred svadbou tiež kanec, ale teraz je z neho len obyčajná sviňa.”              ', 217, 2.8, 25),
	(5697, 'Hovorí manžel:\r\n"Drahá správaj sa ku mne ako k nášmu psovi."\r\nOna:"ale prečo drahý?"\r\nOn: "daj mi nažrať a pusti ma von!"              ', 145, 4, 25),
	(5698, 'Fero sa vráti o tretej ráno domov ožratý ako doga. Manželka Mara ho začne hneď vo dverách spovedať:\r\n”Kde si bol ty prasa?”\r\n”Nóó, stará, jednoducho som si trochu užíval.”\r\n”A koľko si pri tom užívaní minul?”\r\n”Ani nie päť tisíc...”\r\n”Ach ty idiot, vieš si predstaviť, koľko by mne vydržalo päť tisíc?!?”\r\n”Nóó, nepiješ, nefajčíš, kundu máš vlastnú...” zamyslel sa Fero, ”takže asi až do smrti...”              ', 478, 4.03, 25),
	(5699, 'V byte u Fera zvoní telefón.\r\n”Prosím ťa, zdvihni to,” hovorí Fero manželke, ”a ak by chcel niekto mňa, povedz, že nie som doma.”\r\nMara zdvihne slúchadlo, chvíľu počúva a potom ticho povie:\r\n”Manžel je doma.”\r\n”Nepovedal som ti, že nie som doma?!” rozčúli sa Fero.\r\n”Upokoj sa, Ferko, nebolo to pre teba.”              ', 356, 3.57, 25),
	(5700, 'Sedia Fero s Mišom na pive a Fero vraví:\r\n”Človeče, tak ja sa rozvádzam...”\r\n”Nevrav! Čo sa stalo?”\r\n”Jedno prerieknutie a manželka sa chce nechať rozviesť.”\r\n”Kvôli prerieknutiu? To vari nie?”\r\n”Včera ráno sedíme pri raňajkách, dal som si kávu a chystám sa manželke povedať: Miláčik, prosím ťa, bola by si taká láskavá a podala by si mi cukor?”\r\n”Prosím ťa? Čo sa dá na tej vete popliesť?”\r\n”No povedal som: Ty stará krava, celý život si mi pokazila!”\n', 515, 3.62, 25),
	(5701, 'Muž prichádza domov s pochmúrnou náladou. Kabát odhadzuje do kúta, nepozdraví svoju manželku, pripravenú večeru je s nechuťou. Vidiac to všetko jeho žena, snaží sa mu zlepšiť náladu:\r\n”Drahý, som tehotná.” vraví mu.\r\n”Bože, ty tiež?!”              ', 279, 4.2, 25),
	(5702, 'Príde dievčatko k susedom a vraví:\r\n”Mamička sa pýta,či by ste jej nepožičali dva hrnce.”\r\n”A načo ich potrebuje?”\r\n”Chce ockovi ešte niečo povedať.”\n', 174, 2.8, 25),
	(5703, 'Dedo Mráz presviští komínom, pristane v detskej izbe. Od vedľa začuje nejaké zvuky, tak zakričí:\r\n”Hej, deti! Dedo Mráz vám priniesol darčeky!”\r\nVedľa ostane ticho a ozve sa:\r\n”Tak mu odkáž, nech to zloží v pivnici, deti budú až na budúci rok.”              ', 286, 3.29, 25),
	(5704, 'Sedí Fero s kamarátmi v krčme a oni do neho hučia:\r\n”Neber si ju! Pozri sa na ňu, aká je škaredá!”\r\nOn sa nedá prehovoriť, ožení sa s Marou a mesiac sa v krčme neukáže. Keď sa nakoniec objaví, sťažuje sa:\r\n”To je hrôza! Stále to odo mňa chce. Pred raňajkami, po raňajkách, pred obedom, po obede, popoludní, večer, v noci, stále!!!”\r\nA kamaráti na to:\r\n”My sme ti radili - neber si škaredú ženu, budeš na to sám!”              ', 472, 3.63, 25),
	(5705, 'Manželský pár nemôže otehotnieť, a preto sa objednajú u odborníka. Keď testy nič nezistia, doktor im navrhne, aby súložili pred jeho očami. Všetko ide tak, ako má a doktor je už z toho zúfalý. Zrazu si všimne, že muž sa chystá vyvrcholiť, ale ten sa zrazu postaví a ide preč. Doktor nato:\r\n”Čo to robíte!?”\r\nMuž:\r\n”Idem na záchod. Ide na mňa čudné šťanie.”              ', 412, 4.09, 25),
	(5706, 'Manžel vstal od stolu a zamieril do kúpeľne. V tom momente spadli na miesto, kde sedel ťažké nástenné hodiny. Manželka len sucho podotkla: ”Tie hodiny stále meškajú.”              ', 196, 3.91, 25),
	(5707, 'Ideálne manželstvo:\r\n”Zlato, dnes večer ma nečakaj, prídem až nadránom.”\r\n”Dobre, miláčik, ale môžem sa na to spoľahnúť?”              ', 157, 3.38, 25),
	(5708, 'Žena s milencom. Z predsiene počuť, že manžel sa už vrátil.\r\n”Chytro bež na balkón!” kričí žena.\r\nManžel to počuje a hovorí:\r\n”Koľkokrát ti mám opakovať, že nemáme žiaden balkón!”              ', 224, 3.2, 25),
	(5709, 'Sedia chlapi v krčme a Jano sa pýta Ďura.\r\n-"Počúvaj, kedy sa najviac vzruší Tvoja stará?"\r\n-"Ja ani presne neviem, ale určite je to keď si po milovaní vtáka utriem do záclony."              ', 204, 3.4, 25),
	(5710, '”Ja a moja žena sme boli najšťastnejší ľudia na svete.”\r\n”A potom?”\r\n”Potom sme sa spoznali...”              ', 127, 3.67, 25),
	(5711, 'Jano rozpráva kamarátom:\r\n”Mal som všetko. Dom, auto, lásku krásnej ženy.”\r\n”A čo sa stalo?”\r\n”Dozvedela sa to moja manželka!”              ', 160, 3.87, 25),
	(5712, 'Hovorí mladomanželka svojmu mužovi:\r\n”Chcem mať tri deti.”\r\nOn nesúhlasí a vraví, že dve úplne stačia. Vášnivo o tom začnú diskutovať, ani jeden však nechce ustúpiť. Nakoniec muž vraví, že po druhom dieťati sa dá vykastrovať a hotovo!”\r\nŽena na to:\r\n”Ako chceš, ale verím, že aj to tretie dieťa budeš mať rád ako svoje!”              ', 376, 3.47, 25),
	(5713, '”Čo dostaneš na Vianoce od manželky?” pýta sa Fero Miša.\r\n”Ale, nejakého chlapa.”\r\n”Čože?!”\r\n”Videl som, že ho má manželka schovaného v skrini.”              ', 186, 3.82, 25),
	(5714, 'Fero sa pýta známeho:\r\n”Ako to, že každý deň varíš miesto manželky večeru ty? To je tvoja záľuba?”\r\n”No, skôr pud sebazáchovy.”              ', 163, 3.6, 25),
	(5715, 'Na súde:\r\n”Prečo ste nepomohli svojej manželke, keď sa topila?”\r\n”Kto mal vedieť, že sa topí. Jačala na mňa ako vždy.              ', 147, 4.07, 25),
	(5716, '”Predpokladám, že máš naozaj silný motív, keď sa odvážiš prísť domov ráno o šiestej a totálne ožratý!” kričí nervózna žena na svojho muža.\r\n”Pravdaže mám.” odpovedá opitý muž. ”Raňajky.”              ', 240, 3.94, 25),
	(5717, 'Jano si to rozdáva so svojou ženou a v najlepšom jej povie:\r\n”Drahá, ty ju máš ako kombajn.”\r\nŽena sa naštve, zlezie z neho, otočí sa chrbtom a robí sa, že spí. Takto ho ignoruje aj ďalší večer a na tretí večer to už Jano nevydrží a vraví jej:\r\n”Veď sa už toľko neondej... no...”\r\nŽena však odmieta ďalej a nakoniec naštvane vraví:\r\n”Nechaj ma, ja kvôli takému tenkému slabému klásku nebudem štartovať celý kombajn.”              ', 481, 4, 25),
	(5718, 'Manželský párik sa miluje a po chvíli hovorí ona jemu:\r\n”Počúvaj, dnes je to o ničom.”\r\nOn na to:\r\n”Ani ty si nevieš na nikoho spomenúť?”               ', 171, 3.8, 25),
	(5719, 'Muž sa pýta ženy v posteli:\r\n”Tak čo, aké to je?”\r\n”Pripomína mi to plavbu po oceáne!”\r\n”Takže som divoký a romantický?”\r\n”Nie! Je mi z teba zle!”              ', 186, 4, 25),
	(5720, 'Príde žena od lekára a vraví manželovi:\r\n”Starý, mám pre teba zlú správu! To, o čom sme si celý život mysleli, že je orgazmus, tak to bola len obyčajná astma.”              ', 192, 4.1, 25),
	(5721, '- Pán doktor, môj muž stále hovorí v spánku. Čo mám robiť?\r\n- Dajte mu príležitosť, aby mohol prehovoriť cez deň.              ', 141, 4.07, 25),
	(5722, 'Záhorák je vo verejnom dome. Zazvoní mu mobil. Zdvihne, počuje svoju manželku a zhrozí sa: “Preboha, ako si ma tu našla?!”              ', 147, 3.67, 25),
	(5723, 'Vynikajúcemu bežcovi zomrie žena. Rozhodne sa, že na jej pamiatku odbehne 10 km. Tak uteká, uteká a zbadá peknú ženu. V tom mu padne z čista jasna tehla na hlavu a on len pozrie hore a povie:\r\n”Do kelu, ty už si hore?”              ', 247, 3.44, 25),
	(5724, '- Marka, zo mňa sa asi stal zoofil.\r\n- Preboha, ty miluješ zvieratá?!\r\n- Nie, tvoje kozy.              ', 106, 3.83, 25),
	(5725, 'Pani Nováková stretne na ulici pani Blažkovú aj s manželom a vraví:\r\n- Dobrý deň, pani Blažková. Kamže? Na nákupy?\r\n- Ale, ideme manželovi kúpiť topánky. Asi o hodinku budeme doma, zastavte sa na kávu.\r\nPani Nováková príde teda k Blažkovým, zazvoní, Blažková otvorí celá v čiernom. Pozve pani Novákovú ďalej a v kuchyni na stole leží rakva, okolo nej sviečky a v rakve mŕtvy pán Blažek.\r\n- Preboha! - vydesí sa pani Nováková. - Čo sa mu stalo, ešte pred hodinou vyzeral úplne zdravo.\r\n- Tak si to predstavte. Prišli sme do obchodu, Karol si vybral topánky a ja mu hovorím: “Karol radšej si ich vyskúšaj, aby ti neboli malé”. Ale on, že nie. Tak sme ich kúpili, prišli sme domov a predstavte si - tie topánky mu boli malé. No povedzte, pani Nováková, nezabili by ste ho?              ', 844, 4.09, 25),
	(5726, 'Má elektrický šľahač, hriankovač a rúru. Hovorí, že "v domácnosti je príliš mnoho prístrojov a nie je kam si sadnúť". Kúpil som jej teda elektrické kreslo."              ', 187, 3, 25),
	(5727, 'Pýtal som sa ženy, kam chce ísť na výročie svadby. Povedala, že niekam, kde dlho nebola. Tak som jej navrhol, že pôjdeme do kuchyne.               ', 156, 3.5, 25),
	(5728, 'Príde chlap domov úplne namol, vojde do spálne a hovorí manželke:\r\n“Božka, mám chuť na sex!”\r\n“Dnes to nejde, dnes mám svoje dni.“ Chlap ju neposlúchne a vrhne sa na ňu. Keď je po všetkom, ide do kúpelne. Keď pozrie na svoje ruky od krvi, vydesene vykríkne:\r\n“Preboha, ja som ju zabil!”\r\nPozrie do zrkadla.\r\n“Preboha, ja som ju i zožral!”\n', 372, 3.57, 25),
	(5729, 'Stojí chlapík na WC,ciká a pozerá na černocha vedľa:\r\n”Ehm, to vy černosi máte takých dlhých od narodenia?”\r\n”Nie, to si musíš vypestovať.”\r\n”A ako to robíte?”\r\n”No to vieš, keď súložíš, musíš zasunúť rýchlo dnu a pomaly von.”\r\nTak chlapík príde domov, rozdáva si to so ženou a spomenie si na toho černocha. Tak to aj on skúsi rýchlo dnu a pomaly von. Na to sa manželka strhne:\r\n”Fuj, ty zvrhlík nechutný, robíš to ako černoch.”              ', 500, 3.91, 25),
	(5730, 'Veľmi sa podobáte na môjho tretieho manžela.\r\nA koľkých ste mali?\r\nDvoch.              ', 93, 4.11, 25),
	(5731, '- Počúvaj Karol, bol tu nejaký chlap a chcel kúpiť osla.\r\n- A čo si mu povedala ?\r\n- Že nie si doma...              ', 123, 3.4, 25),
	(5732, '- Denne chodíš domov opitý, vyčíta Anka svojmu  mužovi. A čo ja a deti?!\r\n- Maj rozum, žena, predsa nebudeme slopať všetci.              ', 147, 4.14, 25),
	(5733, '- Pán Koenigswald, mohol by som mať to potešenie a hovoriť s vašou pani? \r\n- No, keď tomu vravíte potešenie, pre mňa za mňa.              ', 148, 3.83, 25),
	(5734, '- Na mojom psovi ma dráždi, že je veľmi bojazlivý. Len čo sa manželka vráti domov, zalezie pod posteľ.\r\n- A čo je na tom také zlé?\r\n- To, že pod posteľou je málo miesta pre dvoch.              ', 208, 3.5, 25),
	(5735, '- Fero, čo si dal žene k výročiu svadby?\r\n- Podnos.\r\n- Vidíš, aj ja som mohol mojej jednu vypáliť!              ', 120, 3.45, 25),
	(5736, '- Včera sme sa s manželkou pohádali, ale nakoniec som mal aj tak posledné slovo.\r\n- A čo si jej povedal?\r\n- Tak si to kúp.                 ', 145, 3.5, 25),
	(5737, '- Obžalovaný, prečo ste zabili svoju ženu?\r\n- Musel som podľa zákona, bola to šialená krava …              ', 117, 3.14, 25),
	(5738, '- Čo nepovieš? Tvoj manžel ťa pristihol s milencom v posteli? A ako to vzal?\r\n- Videokamerou.              ', 111, 3.57, 25),
	(5739, 'Otázka na Rádio Jerevan :\r\n- Viete prečo sa všetky nevesty vydávajú v bielych šatách ?\r\n- Lebo väčšina kuchynských spotrebičov je bielej farby.              ', 170, 4, 25),
	(5740, 'Háda sa pani Zlatica so svojím manželom:\r\nObetovala som ti najlepšie roky svojho života...\r\nPreboha, to budú ešte aj horšie?!              ', 147, 4, 25),
	(5741, 'Ty, Julka, ja mám vážne obavy, že ma manžel už nemiluje.\r\nÁno, a prečo si to myslíš?\r\nNo, už sa skoro desať rokov neukázal doma...              ', 157, 3.75, 25),
	(5742, 'Drahá, keby som zbankrotoval, ľúbila by si ma aj potom?\r\nÁno, ale chýbal by si mi...\n', 90, 3.83, 25),
	(5743, '"Pán vedúci, môžete mi dať zajtra voľno? Manželka chce, aby som jej pomohol s vianočným upratovaním." \r\n"Z takého dôvodu vám predsa nebudem dávať voľno." \r\n"Ďakujem, vedel som, že sa na vás môžem spoľahnúť."              ', 245, 4.28, 25),
	(5744, 'Manželka pána Nováka príde domov a pýta sa ho:\r\n- Čo robíš v tej komore ?\r\n- Fotky. - odpovedá pán Novák.\r\n- A čo takého máš na nich, keď ich musíš robiť potme, há?              ', 198, 3, 25),
	(5745, 'Manžel príde domov a hovorí: \r\nŽena, vyhral som 20 miliónov na športke! Zober si šaty.\r\nA mám si zobrať tie čierne alebo tie červené?\r\nTo je jedno, hlavne už vypadni!              ', 193, 3.5, 25),
	(5746, 'Žena hovorí mužovi: Bol tu Marek a povedal, že z chytania rýb nebude nič, pretože maľujú krčmu.              ', 119, 3.73, 25),
	(5747, 'Manželka hovorí večer mužovi:\r\n- Tak dobre. Pustím ťa do krčmy, ale musíš byť do deviatej doma!!!\r\n- Tak fajn. Do deviatej budem doma, a potom vyrazím do krčmy ...              ', 189, 3.4, 25),
	(5748, 'Pýtajú sa pani Ťažkej, či sa chce nechať po smrti spopolniť, alebo sa nechá pochovať. "Čo ja viem? Ale asi dám na svojho muža a poslúchnem ho." "A ten čo hovorí ?" "Ten mi stále vraví, že sa mám dať vypchať.."              ', 244, 3.8, 25),
	(5749, 'Pýta sa manžel manželky: \r\n- Miláčik prosím ťa môžem sa pozerať na televízor? \r\n- Môžeš, len ho nezapínaj.\n', 122, 3.63, 25),
	(5750, 'Príde starší manželský pár do reštaurácie, dostaví sa k nim čašník a opýta sa ženy: \r\n"Čo si dáte?" \r\nŽena odpovedá: \r\n"Párky." \r\nČašník pokračuje: \r\n"A chren?" \r\n"Aj chren si dá párky," odvetí žena.              ', 240, 3.94, 25),
	(5751, 'Chladné novembrové ráno na Volge, hustú hmlu prerazí čln, vzadu sedí Marušja a vesluje proti prúdu, až sa jej potia končeky vrkočov. Vpredu leží Ivan Vasiljevič a spokojne pofajčieva machorku. Vtom sa v opačnom smere z hmly vynorí iný čln, na ňom vesluje Kuzma Trofimyč a volá: \r\n„Kamže si sa vybral, Ivan Vasiljevič, takto skoro ráno?"\r\nIvan Vasiljevič vyberie z úst fajku, rozvážne vyfúkne obláčik a prehodí: \r\n„Ále ... kam by som šiel, veziem manželku   do pôrodnice."\n', 514, 3.75, 25),
	(5752, '"Váš manžel potrebuje pre spanie absolútny kľud. Predpíšem vám uspávacie prášky." \r\n„Kedy mu ich mám podať, pred večerou alebo po večeri?"\r\n„Jemu nie! Tie prášky sú pre vás."              ', 211, 4, 25),
	(5753, 'Manželia prišli k doktorovi a ten vraví manželovi:\r\n„Viete, tá Vaša manželka sa mi vôbec nepáči."\r\nManžel na to: \r\n„Ani mne pán doktor."              ', 166, 3.33, 25),
	(5754, '"Už si to počul, že sa od Joža odsťahovala manželka?"\r\n"Hej? A ako to znáša?" \r\n"No, teraz už je v poriadku, ale zo začiatku mal strach, že sa vráti."              ', 176, 4.17, 25),
	(5755, 'Žena usmerňuje manželovo cúvanie: \r\n„Môžeš, môžeš ... ešte môžeš ... No, a teraz sa poď pozrieť, čo si urobil!"              ', 144, 3.9, 25),
	(5756, 'Po piatich rokoch sa ocko s mamkou opäť udobrili. Mamka na ocka po dlhej dobe opäť prehovorila. Vidím ten krásny okamih ako dnes. Bolo to počas štedrovečernej večere. Povedala mu: \r\n„Žer!"\n', 202, 4.14, 25),
	(5757, 'Muž sleduje hokejový zápas. Žena natiera strechu. Po chvíli sa ozýva pod oknom manželkin prosebný hlas:\r\n- Jožko, keď začne prestávka, zavolaj mi prosím sanitku!              ', 188, 3.86, 25),
	(5758, 'Manželka volá do práce. Manžel zdvihne telefón a hovorí: \r\n- Zlato, prepáč, ale mám tu strašný frmol, nemôžem s tebou hovoriť. \r\n- Ale ja mám pre teba  jednu dobrú a jednu zlú správu! \r\n- Dobre, zlato. Môžem ti venovať len chvíľku, takže len tú dobrú, áno? \r\n- Tá dobrá je, že airbag funguje.              ', 336, 4, 25),
	(5759, '„Drahý," túli sa pani Zlatica k manželovi. „Všakže s tým novým účesom už nevyzerám ako stará baba?"\r\n„Nie, teraz vyzeráš ako starý dedo..."              ', 174, 3.82, 25),
	(5760, 'Do ordinácie sa vrúti rozzúrená žena posiata modrinami a kričí: \r\n„Kde je ten psychiater, ktorý vyliečil môjho manžela zo zbabelosti?!"              ', 162, 3.75, 25),
	(5761, 'Na futbalovom ihrisku huláka útla ženička na rozhodcu:\r\n- Odíď odtiaľ, ty šalát! Ako to pískaš, ty jaternica?! Ty si dobrý tak na pranie plienok pre deti, a nie na sudcovanie, frajer!\r\n- Ako môžete niečo také tvrdiť? pohoršuje sa sused.\r\n- A čo by som nemohla, odvrkla ženička. - Veď je to môj muž!              ', 336, 4.17, 25),
	(5762, 'Mládenec už päť rokov chodí do rodiny, ale o ženbe nepadlo ani slovo. Netrpezlivá budúca svokra to nevydrží:\r\n- Tak sa už konečne vyjadri, alebo si moju dcéru zoberieš, alebo sa viac neuvidíme!\r\nMládenec chvíľu váha a potom nesmelo povie:\r\n- Ak by ste súhlasili, tak sa rozhodnem pre oboje.              ', 324, 4.15, 25),
	(5763, 'Manželka čaká na svojho muža, ktorý sa išiel zabávať s priateľmi. Keďže sa do rána nevrátil, manželka odišla do práce. Keď sa vrátila domov, zastihne svojho muža ako sedí na pohovke a drží nad hlavou dáždnik.\r\n- Prosím ťa, čo to robíš? - vykríkne žena.\r\n- Čakám búrku, - skormútene odpovie polovička.              ', 350, 4, 25),
	(5764, 'Manželka dranká kožuch:\r\n- Drahý, na Vianoce chcem od teba líšku!\r\n- Dobre, drahá, ale klietku si budeš čistiť sama!              ', 140, 3.67, 25),
	(5765, 'Manželka si dala na tvár bahennú masku a dva dni vyzerala oveľa lepšie. Potom bahno opadalo.              ', 111, 3.9, 25),
	(5766, 'Nedeľný obed u nemenovaného poslanca. Zrazu poslanec buchne po stole a zakričí.\r\n- Kto je pánom v tejto rodine?!!\r\nObratom dostane takú facku, že skoro spadne zo stoličky.\r\n- Ale Marienka, to sa už ani spýtať nemôžem?              ', 245, 4.2, 25),
	(5767, 'Poslanec sa pýta kolegu z klubu:\r\n- Prečo včera na teba tak ziapala tvoja stará? Počul som to aj cez stenu.\r\n- To nebolo na mňa. Kričala na psa.\r\n- Chudák pes! Začul som, že musí odovzdať aj zvyšok výplaty.              ', 234, 3.96, 25),
	(5768, 'Žena umýva podlahu, muž sedí v kresle a číta si noviny.\r\nŽena hovorí: \r\n”Zdvihni nohy, aby som mohla utrieť podlahu.”\r\n”To už bez mojej pomoci nedokážeš ani umyť podlahu?”              ', 207, 3.86, 25),
	(5769, 'Tak čo si vybral žene na Vianoce?\r\nVkladnú knižku.              ', 68, 4, 25),
	(5770, 'Pýta sa žena muža: \r\n“Čo by si urobil, keby ma uniesol cudzí muž?”\r\n“Nikdy by som na teba nezabudol.”              ', 129, 3.7, 25),
	(5771, 'Včera sme sa s manželkou strašne pohádali, ale nakoniec priliezla po kolenách.\r\n- A čo hovorila?\r\n- Vylez spod toho gauča, ty srab!              ', 152, 4.03, 25),
	(5772, 'Manžel sa vracia domov neskoro:\r\n"Kde si bol tak dlho? A hlavne mi netvrď, že v práci!"\r\n"Prepáč, bol som v práci. Ale všetci odišli a mňa zabudli zobudiť."\n', 168, 3.7, 25),
	(5773, 'Mladý abstraktný maliar sa oženil so slečnou z lepšej rodiny. Po čase sa ich priatelia pýtajú, ako sa im darí.\r\n"Veľmi dobre, ja maľujem, žena varí. Potom ona háda čo som namaľoval, a ja hádam, čo ona uvarila."\n', 229, 4, 25),
	(5774, '"Drahá, vieš, aký je rozdiel medzi autobusom a taxíkom?"\r\n"Nie."\r\n"Tak pôjdeme autobusom."\n', 96, 3.93, 25),
	(5775, 'Manžel vyčíta žene:\r\n"Pozorujem, že sa staráš o svoje šaty omnoho viac než o mňa!"\r\n"Áno, ale bez teba sa môžem ukázať všade, ale bez šiat nie."\n', 162, 3.71, 25),
	(5776, 'Manželia ležia v posteli, manžel sa chystá zaspať a v tom mu žena hovorí:\r\n"Mohol by si mi aspoň raz povedať niečo milého, nežného."\r\n"A čo by to ako malo byť."\r\n"Že som tvoj poklad najdrahší." \r\n"Si môj poklad najdrahší."\r\n"Že ma miluješ."\r\n"No tak milujem ťa."\r\n"No a teraz si vymysli niečo sám."\r\n"Dobrú noc Božka."\n', 347, 4.03, 25),
	(5777, '"Pane, ako tak na vás pozerám, vy ste tak podobný mojej žene, ako by ste jej z oka vypadol, až na tie fúzy."\r\n"Ale ja nemám fúzy!"\r\n"No práve, moja žena áno."\n', 170, 4.13, 25),
	(5778, '"Už tri dni som svojej žene nepovedal ani slovíčko."\r\n"Vy ste sa pohádali?"\r\n"Nie, ale nikdy sa mi nepodarili skočiť jej do reči."\n', 139, 3.86, 25),
	(5779, '"Tak si myslím, pani Horná, že som sa omrzela svojmu mužovi."\r\n"Prečo myslíte?"\r\n"No, tri roky sa už neukázal doma."\n', 125, 3.56, 25),
	(5780, '"Drahý, prosím ťa, prečo stojíš vždycky pri okne, keď spievam?"\r\n"Aby si ľudia nemysleli, že ťa mlátim!"\n', 117, 3.92, 25),
	(5781, '"Už ste niekedy skúšali s vašim manželom ísť na dovolenku oddelene?"\r\n"Áno, pred dvoma rokmi - a doteraz sa ešte nevrátil."\n', 134, 3.87, 25),
	(5782, '"A ako to máte vy s dovolenkou?"\r\n"Ťažké. Kedy pôjdem, to rozhodne vedúci, kam pôjdem, to rozhodne manželka a ja musím rozhodnúť, kde na to vziať."\n', 160, 4.04, 25),
	(5783, 'Muž príde domov a nájde svoju ženu v slzách.\r\n"Tvoja matka ma hrozne urazila."\r\n"Ako ťa mohla uraziť, keď je na druhom konci sveta?"\r\n"Dnes prišiel list pre teba.\r\n Zo zvedavosti som ho otvorila, no a na konci bolo napísané: P.S. Drahá Marta, keď ten list budeš mať prečítaný, nezabudni ho dať môjmu synovi."\n', 329, 4, 25),
	(5784, 'Príde manžel z práce, otvorí ľadničku, pozrie sa dovnútra a tresne dverami.\r\nNa druhý deň zas príde z práce, pozrie sa do ľadničky a tresne dverami:\r\n"Už zas!"\r\nTretí deň príde domov, otvorí ľadničku a volá:\r\n"Mária, ja ťa zabijem, ak v tej ľadničke nebudeš zhasínať svetlo!"\n', 304, 3.63, 25),
	(5785, '"Dcéra sa mi priznala, že sa chcete vziať. Dohodli ste už deň svadby?" pýta sa otec budúceho zaťa.\r\n"Tento problém som prenechal jej."\r\n"A obrad bude cirkevný alebo civilný?"\r\n"O tom rozhodne jej matka."\r\n"A z čoho budete žiť?"\r\n"To, prosím, záleží na Vás!"\n', 277, 3.33, 25),
	(5786, 'Muž začne podnikať a chodí domov neskoro a úplne groggy.\r\nRaz tak zas príde domov, doplazí sa do postele a keď sa konečne natiahne, žena mu hovorí:\r\n"Miláčik, a nezabudol si kvôli tomu podnikaniu na manželské povinnosti?"\r\nA on s príslušnými nadávkami vstane a ide umyť riad.\n', 297, 4.02, 25),
	(5787, '"Čo som sa oženil, všetko je mi zakázané. Fajčiť nesmiem, piť nesmiem a do krčmy tiež nesmiem."\r\n"No a prečo neprotestuješ?"\r\n"Protestovať tiež nesmiem."\n', 168, 3.8, 25),
	(5788, '"Som tak rada, že sa už s manželom nehádate. Včera ste boli tak svorní, keď ste spolu pílili drevo."\r\n"My sme nepílili drevo, my sme si delili nábytok."\n', 163, 3.5, 25),
	(5789, 'Bavia sa dvaja kamaráti:\r\n"Manželka teraz posledné tri mesiace drží nejakú brutálnu diétu, ľadnička stále prázdna, už ma to moc nebaví."\r\n"No a má aspoň nejaké výsledky?"\r\n"Áno, zhodila za tú dobu 15 dkg."\r\n"No aspoň niečo, nie?"\r\n"No áno, ale ja som zhodil 10 kilo a náš pes umrel od hladu!"\n', 318, 3.73, 25),
	(5790, 'Manžel:\r\n"Drahá, čo si takto niekam večer vyraziť a užiť si?"\r\nŽena:\r\n"Prečo nie. Ale keby si prišiel domov skôr než ja, nechaj svietiť v predsieni."\n', 163, 3.8, 25),
	(5791, '"Vieš, že Novákovci už týždeň spolu nehovoria?"\r\n"A prečo?"\r\n"Pani Nováková požiadala manžela o 300 korún, že chce ísť do salónu krásy a on jej dal hneď tisícku."\n', 183, 3.87, 25),
	(5792, 'Žena raz večer hovorí:\r\n"Dve veci viem najlepšie. Sekanú a štrúdlu."\r\nA manžel sa pýta:\r\n"A toto je ktorá?"\n', 118, 4.25, 25),
	(5793, '"Ako sa má tvoj nový papagáj?"\r\n"Ale, umrel týždeň po tom, čo som ho kúpil."\r\n"Čože, a na čo?"\r\n"Na vyčerpanie, súťažil s mojou ženou v ukecanosti."\n', 165, 3.79, 25),
	(5794, 'Zistil som, ako naučím moju ženu opatrnejšie riadiť auto. Povedal som jej, že keby sa niekedy stala účastníčkou nehody, tak v novinách napíšu jej skutočný vek.\n', 175, 4.08, 25),
	(5795, 'Na súde sa pýta rozvodový sudca manžela: \r\n- A kedy začali medzi vami prvé nezhody? \r\n- Keď som trval na tom, že aj ja chcem byť na svadobnej fotografii.\n', 163, 3.88, 25),
	(5796, 'Muž stojí na osobnej váhe a vťahuje brucho. Žena sa ho pýta:\r\n- Myslíš, že ti to pomôže?\r\n- To vieš, že pomôže, ináč by som nevidel na ručičku.\n', 163, 4.11, 25),
	(5797, 'Drahá moja, viem, že mi nebudeš veriť, ale túto polievku som upiekol celkom sám...              ', 102, 3, 25),
	(5798, 'Fero sa vráti zo služobnej cesty a zistí, že jeho manželku Maru ráno odviezli do pôrodnice.\r\nUteká za ňou. Môže sa však s ňou zhovárať iba cez okno a tak celý nedočkavý kričí:\r\n- Čo sa nám narodilo?\r\n- Chlapec. - kričí Mara.\r\n- Koľko váži?\r\n- Štyri kilá.\r\n- A na koho sa podobá?\r\n- Nepoznáš...              ', 339, 3.86, 25),
	(5799, '"Žofka, dneska ťa umilujem k smrti," povedal manžel, sadol si k televízií a zaspal.\r\n"Tak čo, "budí ho žena, bude niečo?" \r\n"Vieš čo, darujem ti život..."              ', 180, 4.05, 25),
	(5800, 'Rozhovor dvoch mužov:\r\n- Vraj ti kartárka predpovedala, že ťa opustí žena.\r\n- No...nepovedala to tak priamo. Povedala iba, že ma čakajú lepšie časy              ', 172, 3.86, 25),
	(5801, 'Manžel navštívi doktora svojej manželky. Doktor mu hovorí:\r\n- Tak ten test sme vašej manželke urobili. Bohužiaľ sa nám pár výsledkov pomiešalo. Vaša manželka má buď Alzheimerovú chorobu alebo AIDS.\r\n- Preboha, čo mám teraz robiť? - pýta sa zúfalý manžel.\r\n- Najlepšie bude, keď si s manželkou urobíte výlet a vysadíte ju niekde ďaleko od domova. Keď nájde cestu domov, už by som s ňou nespal.\n', 429, 4, 25),
	(5802, 'Žena pred zrkadlom nacvičuje zvláštne cviky. Manžel sa jej pýta:\r\n- Čo to, prosím ťa, vyvádzaš?\r\n- Nacvičujem sebaobranu. Čo keby ma v noci prepadol sexuálny maniak?\r\n- To cvičíš zbytočne. Až taká tma nikdy nebude... \n', 238, 3.6, 25),
	(5803, 'Manželia sa chystajú na návštevu. Muž sa pýta novomanželky:\r\n- Miláčik, čo myslíš, ktorú košeľu si mám vziať, tú bez dvoch gombíkov alebo tú so špinavým golierom?              ', 198, 4.15, 25),
	(5804, 'Rodiná dovolenka pri mori. On kričí na svoju drahú polovičku:"Miláčik, neplávaj pri brehu! Tam nie sú žraloky."              ', 135, 4.22, 25),
	(5805, 'Sedia dve kamarátky v kaviarni a jedna sa pýta:\r\n- Tiež musíš manželovi hovoriť, keď dosiahneš orgazmus?\r\n- Nie, ja mu nesmiem volať do práce.              ', 167, 4.05, 25),
	(5806, '“Tati, prečo si sa oženil s maminkou?”\r\n“Vidíš,” obráti sa muž k žene. “Ani to dieťa to nedokáže pochopiť!”              ', 144, 4.07, 25),
	(5807, 'Na špiritistickej seanse volá žena muža, ktorý je na druhom svete:\r\n- Počuješ ma, miláčik?\r\n- Áno, počujem.\r\n- Máš sa tam dobre?\r\n- Áno.\r\n- Je ti tam lepšie ako u mňa?\r\n- Áno, oveľa.\r\n- Ako je tam hore, v nebi?\r\n- Neviem, som v pekle.              ', 266, 3.53, 25),
	(5808, 'Hovorí žena právnikovi:\r\n- Chcem sa dať rozviesť, pretože môj manžel má mizernú pamäť.\r\n- Myslím, pani, že to nie je dostatočný dôvod na rozvod.\r\n- Ale je! - vraví žena. - Vždy, keď sa pri ňom objaví nejaká mladšia žena, zabudne, že je ženatý!              ', 286, 3.53, 25),
	(5809, 'Mladomanželom sa narodí syn a babka vraví mužovi:\r\n- Syn môj, nezdá sa ti čudné, že váš syn má tmavú pleť, hoci vy s manželkou ste bieli?\r\n- Ale babka vieš, manželka mala málo mlieka, tak ho pridájala černoška, a preto mu stmavla pleť.\r\nA babka odvetí:\r\n- Syn môj, keď si sa ty narodil, tiež som mala málo mlieka a pridájala som ťa kravským. Ale že bude z teba taký veľký vôl, to som si nikdy nemyslela.              ', 452, 4.22, 25),
	(5810, 'Muž sa ráno o šiestej vracia domov, potichu otvorí dvere, za nimi však stojí manželka a tresne ho valčekom na cesto.Po hodine sa muž preberie a manželka sa mu s plačom ospravedlňuje:\r\n"Prepáč zlatko, ja som zabudla, že tento týždeň máš nočné..."              ', 281, 4.15, 25),
	(5811, 'Jožo stretne kamaráta a vraví mu:\r\n- Predstav si, čo sa u nás včera stalo! Manželka varila večeru, išla do komory po zemiaky a zomrela.\r\n- Strašné... a čo si urobil?\r\n- No nič. Uvaril som si ryžu.               ', 225, 3.73, 25),
	(5812, 'Predavač v obchode so zbraňami sa pýta pána Kabeša:\r\n"Na čo si kupujete túto zbraň?"\r\n"Na medveďa!" povie Kabeš bez rozmýšľania.\r\n"No vidíte, ja zase tej mojej hovorím hyena!"              ', 204, 3.97, 25),
	(5813, 'Manžel vraví žene:\r\n"Čo keby sme dnes vyskúšali nejakú novú polohu? Napríklad sa vymeníme."\r\n"Dobrý nápad." vraví manželka. "Ty sa postavíš k drezu a budeš umývať riad a ja si sadnem na pohovku a budem prdieť."              ', 244, 4, 25),
	(5814, 'Rozprávajú sa dvaja kamaráti:\r\n"Mojej žene sa včera snívalo, že som milionár."\r\n"To nič, mojej sa to zdá pri každom nákupe."              ', 150, 3.88, 25),
	(5815, 'Manželský pár sa vyberie k studni želaní. Najprv pristúpi manžel, niečo si zašomre a odíde. Pristúpi žena, veľmi sa nakloní a spadne do studne. Muž po piatich minútach vraví:\r\n"Ty kokso, ono to funguje."              ', 234, 3.66, 25),
	(5816, 'Pýta sa ráno manželka manžela:\r\n"V noci si ma kopal, bil, pľul si na mňa a škaredo si mi nadával. Čo sa ti niečo zlé snívalo?"\r\n"Nie, ja som nespal."              ', 175, 3.83, 25),
	(5817, 'Svadobná hostina skončila a novomanželia sa pobrali do spálne. Pripili si a ženích sa uložil do postele. Nevesta však stále sedela pri okne a pozerala sa na hviezdy. Muž vraví:\r\n"Drahá, ty si nejdeš ľahnúť?"\r\n"Nie. Maminka mi vravela, že toto bude najkrajšia noc v mojom živote, tak z nej nechcem prepásť ani minútu."		                           ', 368, 3.5, 25),
	(5818, 'Príde chlap k lekárovi a vraví mu:\r\n"Mojej žene by som chcel na 20. výročie svadby venovať plastickú operáciu, koľko by to stálo?"\r\nDoktor vraví:\r\n"Ukážte mi fotku."\r\n"Ona je strašne škaredá, tu je fotka."\r\n"Fuuuj, tá je odporná, dám vám zľavu, bude to stáť 100 000 Sk."\r\n"Dobre, prídem za mesiac."\r\nDoktor ho za dva mesiace stretne na ulici a vraví:\r\n"A čo, s manželkou už neprídete?"\r\nA chlap na to:\r\n"Ále, už netreba, našiel som špecialistu, ktorý ju za 50 000 odstrelí...."              ', 527, 3.87, 25),
	(5819, 'Pri mori:\r\n”Drahý, videl si toho pána, čo ma vytiahol z vody, keď si ma tam ráno nechtiac zhodil?”\r\n”Ale áno, celý deň sa mi za to ospravedlňoval.”              ', 178, 4.01, 25),
	(5820, 'Príde chlapík z práce a nájde manželku, ako ju miluje zarastený poplátaný bezdomovec. Zaskočený ostane stáť, manželka si ho všimne a pokojne mu hovorí:\r\n”Drahý, tento pán prišiel, slušne zaklopal, pozdravil a povedal, že vonku je veľká zima, tak či by som mu nedala niečo teplé, čo manžel už nepoužíva.”              ', 351, 4.04, 25),
	(5821, 'Príde chlapík do nemocnice s odseknutým mužstvom. Lekár sa ho pýta:\r\n”Preboha, čo sa vám stalo?”\r\n”Ale, povedal som žene, aby na večeru spravila dačo, čo málo stojí.”              ', 202, 3.56, 25),
	(5822, 'V posteli šepká novomanžel:\r\n”Miláčik, mohol by som v tebe zapáliť milostný oheň?”\r\nJeho manželka sa miesto odpovede rozosmeje.\r\n”Prečo sa smeješ?” pýta sa manžel.\r\n”S tou tvojou zápalčičkou, hej?”              ', 240, 3.92, 25),
	(5823, 'Kamarát sa sťažuje kamarátovi polroka po sobáši:\r\n”Ty, počúvaj, ja už nemôžem. Tá moja to chce stále. Ráno, na obed, večer, celú noc... Ja už nevládzem.”\r\nDobrý kamarát mu odpovie:\r\n”Ja som ti vravel neber si takú škaredú, budeš na to sám.”              ', 287, 4.18, 25),
	(5824, 'Pani Homolová ťahá domov zo striptízu svojho manžela a hovorí mu:\r\n”Starý, lahôdky si videl, večerať sa bude doma.”              ', 143, 3.5, 25),
	(5825, 'Príde chlapec domov a pýta sa:\r\n”Mami, čo je to orgazmus?”\r\n”Neviem, opýtaj sa otca.”              ', 111, 4, 25),
	(5826, 'Bavia sa dvaja kamoši, ako to urobia po návrate k svojej drahej polovičke. Jeden sa sťažuje, že tá jeho ho po návrate z krčmy nechce pustiť domov. Nato mu druhý radí: \r\n"Rob to ako ja, ja keď prídem ku dverám, tak sa vyzlečiem donaha, zazvoním, a keď tá moja otvorí, hodím šaty dovnútra a ona ma rada pustí, aby som nerobil hanbu." \r\nTak ten prvý poďakuje za radu a rozídu sa. O týždeň sa zase stretnú a hneď zďaleka ten prvý volá: \r\n"Počuj, to si mi pekne poradil. Prišiel som, vyzliekol som sa, dvere sa otvorili, ja som hodil šaty dovnútra a počujem: \'Ukončite výstup a nástup, dvere sa zatvárajú!\' a celý barák mi ušiel!"              ', 687, 3.71, 25),
	(5827, 'Niekoľko novozbohatlíkov sa parí v saune, keď zazvoní mobil. Jeden to vezme:\r\n- Áno drahá... V saune s chalanmi... Do 11-tej... Nové šaty? Veď to už budú aspoň 50-te!... Do divadla? 20.000 korún? Tak dobre, kúp si. Peniaze nájdeš ako obvykle.\r\nPo chvíli zase zvoní mobil a znovu ho vezme ten istý:\r\n- Áno drahá... V saune s chalanmi... Do 11-tej... Nový kožuch?... Že nemáš v čom ísť na Kanárske ostrovy? Tak dobre, koľko?... 60 tisíc? Dobre, kúp si ho, peniaze nájdeš tam, kde vždy.\r\nSaunujú sa ďalej a mobil zvoní po tretí raz, zase ho berie ten istý:\r\n- Áno, drahá... V saune s chalanmi... Do 11-tej... Načo 6-te auto?... Aha, tak pochváliť sa pred mamičkou... 2 milióny? Dobre, kúp si ho, peniaze nájdeš ako vždy.\r\nAle keď už zvoní štvrtý raz, tak ho nevezme a hovorí:\r\n- Chlapi, čí je to telefón? Berte si to sami, nebudem nikomu robiť sekretárku!              ', 930, 4.29, 25),
	(5828, 'Tento pár bol zosobášený iba 2 týždne. Manžel, hoci ešte veľmi zamilovaný, nemohol vydržať, kým pôjde do mesta a vyrazí si so svojimi starými kámošmi, tak povedal manželke:\r\n"Miláčik, hneď sa vrátim ..."\r\n"Kam ideš, ňuňuli-ťuťuli.... ?", spýtala sa žena.\r\n"Idem do baru, moja krásna, dám si pivo."\r\n"Chceš pivo, miláčik?" - otvorila chladničku a ukázala mu 25 rôznych druhov piva z 12 krajín: nemecké, holandské, japonské, slovenské, české.... Manžel nevedel, čo robiť a jediné, čo mu zišlo na um, bolo:\r\n"Áno, ňufík-pusík ... ale v bare ... vieš ... chladené poháre ..."\r\nNedokončil ani vetu, keď ho žena prerušila:\r\n"Chceš vychladený pohár, púčik môj?" a vybrala z mrazničky obrovský pivový pohár, zmrznutý tak, až jej začal primŕzať k ruke, ako ho držala. Manžel, trochu pobledlý, hovorí:\r\n"Áno, moja sladká bábika, ale v bare majú tie pečené chuťovky, tie sú naozaj výborné... nebudem dlho. Hneď sa vrátim. Sľubujem. Dobre?"\r\n"Chceš pečené chuťovky, ňuňulík-ťuťulík?"\r\nOtvorila trubu a vybrala 15 plechov rôznych dobrôt: kuracie krídelka, prasiatka v župane, klobúčiky z húb, bravčové rezy atď.\r\n"Ale, cukríček ... v bare ... vieš ...nadávky, hrubé výrazy a to všetko ..."\r\n"Chceš neslušné výrazy, ty môj chutnučký ňufinko? O.K.! Tu máš, vypi si to postraté pivo v tvojom posratom pollitráku a zjedz tie tvoje zasraté chrumky, pretože nejdeš nikam! A už ma neser!!!"              ', 1521, 4.19, 25),
	(5829, 'Muž so ženou idú do reštaurácie na obed. Ako tak sedia, k mužovi príde atraktívna mladá žena, pobozká ho a povie:\r\n"O chvíľu sa stretneme."\r\nManželka sa pobúrene opýta:\r\n"Kto je to?"\r\n"To je moja milenka."\r\n"Ak je to tak, požiadam o rozvod!"\r\n"Ako chceš, ale nebudú už žiadne dovolenky na Maledivách, nakupovanie v Paríži, ani Mercedes v garáži. Rozhodni sa sama."\r\nOdrazu uvidia spoločného známeho v sprievode očarujúcej devy.\r\n"To je kto, tá mladá dáma?" pýta sa manželka.\r\n"Jeho milenka."\r\n"Ale tá naša je krajšia."	              ', 572, 4.29, 25),
	(5830, 'Sťažuje si Mara Dore:\r\n- Môj manžel je 400-percentný impotent.\r\n- Ako je to možné? - čuduje sa Dora.\r\n- No... on bol horolezcom. Raz sa v Tatrách zrútil z hory.\r\nPri tom páde mu lano pricviklo vtáka.\r\nPo dopade si prekusol jazyk a kým prišla horská sluzba, omrzli mu všetky prsty na rukách.              ', 321, 3.71, 25),
	(5831, 'Pride muž domov a nájde ženu holú na posteli. A muž na to:"Ako sa opovažuješ. Chceš,aby ťa niekto uvidel?".\r\nŽena na to:"Tušila som, že prídeš tak ťa čakám." \r\nZa skriňou sa ozve "Kecá".               ', 220, 3.86, 25),
	(5832, 'O tretej ráno sa zobudí manželka a budí svojho manžela...\r\n- Miláčik ja by som sa tak rada pomilovala!!!\r\nA on jej na to...\r\n- Ty si blbá, kde ti mam teraz ráno hľadať chlapa', 185, 3.53, 25),
	(5833, 'Drahá, už sme sa skoro mesiac nemilovali..."\r\nVieš čo? Ty hovor iba za seba,dobre?"', 87, 3.42, 25),
	(5834, 'Idú Fero a Dežo z krčmy. Po chvíli Fero hovorí: Áha, to je móója žééna a moja milenka. A Dežo na to: Isto? Véééď to je moooja žena a moooja milenka.\r\n', 167, 3.44, 25),
	(5835, '-Pamätáš ako si mi sľuboval, že ma budeš nosiť na rukách? hovorí žena vyčítavo mužovi.\r\n-A ty si pamätáš, aká si bola vtedy štíhla?', 150, 3.04, 25),
	(5836, 'Žena má muža na služobke a chce ho prekvapiť.\r\nKúpi vstavané skrine do spálne.Technik skrine dovezie a namontuje.\r\nŽena celá šťastná večer ide spať. Keď zrazu popod okná prejde\r\nelektrička a skrine sa s rachotom zosypú. Ráno zavolá technika,\r\npovie čo sa stalo. Ten neverí ale skrine znova poskladá.\r\nVečer sa situácia zopakuje. Električka .... a skrine spadnú.\r\nNa ďalší deň žena zavolá technika.\r\nTen príde, skrine zmontuje, ale že si teraz už počká čo sa stane.\r\nVečer sa zatvorí do skrine a čaká.\r\nV tom sa manžel vráti, obdivuje skrine, otvorí a vidí chlapa.\r\n- A Ty tu čo robíš?\r\nTechnik hovori : - Rovno mi zmláť, lebo aj tak mi neuveríš, že tu\r\nčakám na električku.\r\n', 734, 4.05, 25),
	(5837, 'Manžel príde domov a nájde v posteli svoju ženu s cudzím chlapom. Vytiahne zbraň a zastrelí ženu. \r\nNa súde sa sudca spýta:\r\n- prečo ste nezastrelil radšej cudzieho chlapa?\r\nOdpoveď:\r\n- pán sudca je to menší hriech ako každý deň zastreliť iného chlapa', 272, 3.96, 25),
	(5838, 'Príde jeden chlapík k očnému:,, Pán doktor ja som oslepol. "Doktor sa ho pýta:,,Čo ste videl pred tým ako ste oslepli? "Muž mu odpovedá:,,Moju ženu s vidličkou v ruke!"', 180, 3.3, 25),
	(5839, '- Viete, čo je šváb v zápalkovej škatuľke? \r\n- Cigánske tamagoči. \r\n', 76, 3.17, 25),
	(5840, 'Manžel jemne uštipne svoju polovičku do zadku a vraví:\r\n- Keby sme si to nechali spevniť, nepotrebovali by sme elastické nohavičky.\r\nPotom ju uštipne do pŕs a vraví:\r\n- Keby sme si to nechali spevniť, nepotrebovali by sme podprsenku.\r\nV tom ho žena uštipne medzi nohy a vraví:\r\n- Keby sme si to nechali spevniť, nepotrebujeme elektrikára, záhradníka, poštára a ani tvojho brata.', 398, 3.67, 25),
	(5841, 'Manželka sa v noci prebudila a zistila, že muž nie je vedľa nej v posteli.\r\nObliekla sa a zišla dolu po schodoch. Muž sedel v kuchyni pri stole so šálkou kávy. Zdal sa byť v hlbokej depresii, len zízal do steny. Odchlipol si z kávy a vtom žena zbadala, ako si utiera slzu z oka.\r\n- Čo sa deje, miláčik? Prečo si tu dolu v túto nočnú hodinu?\r\n- Pamätáš sa, keď sme mali pred 20 rokmi rande a ty si mala len 16?\r\n- Áno, pamätám sa.\r\n- A pamätáš sa, ako nás tvoj otec prichytil pri milovaní na zadnom sedadle môjho auta?\r\n- Áno, pamätám.\r\n- A spomínaš si, ako mi vypálil a povedal: "Buď si vezmeš moju dcéru alebo stráviš najbližších 20 rokov v base!"?\r\n- Áno, spomínam.\r\nMuž si utrel ďalšiu slzu spod oka a vzdychol:\r\n- Vieš... dnes by ma pustili..', 799, 4.29, 25),
	(5842, 'Príde manžel domov a žena sa hneď spýta:\r\n- Kúpil si chlieb?\r\nMuž na to:\r\n- Chlieb, nákupy, varenie, upratovanie... atď., to nie je chlapská práca, moja milá...\r\n- Tak sa vyzleč a poď robiť chlapskú robotu!\r\n- Ježišmaria, ty vôbec nerozumieš srande! Daj mi tú tašku... ', 291, 3.74, 25),
	(5843, 'Manželia idú autom po diaľnici. Žena začne:\r\n"Už ťa nemilujem. Chcem rozvod!"\r\nMuž mlčky pridá rýchlosť na 100 km/h.\r\n"Milujem tvojho najlepšieho kamaráta Fera!"\r\nMuž zvýši rýchlosť na 120 km/h.\r\n"Po rozvode chcem deti, toto auto a dom..."\r\n140 km/h.\r\n"Všetky účty previesť na moje meno..."\r\n160 km/h.\r\n"A čo ty? Ty nechceš nič???"\r\n"Ja mám všetko čo potrebujem", odpovedá muž a pridá na 180 km/h.\r\n"Čo už len ty možeš mať???"\r\n"Ja mám airbag", odpovedá pokojne muž a prudko strhne volant... ', 532, 3.93, 25),
	(5844, 'Stojí žena v spálni pred zrkadlom a obzerá sa nahá. Celá zúfalá hovorí:\r\n- Pleť vráskavá, prsia vyťahané, zadok ako pomaranč, kŕčové žily, účes mi nedrží...\r\nManžel, ležiaci naproti v posteli, ju chce utešiť:\r\n- Ale zrak máš úplne v poriadku!!!', 274, 3.83, 25),
	(5845, 'Traja mŕtvi muži prídu do neba a Boh sa ich pýta ako umreli. Prvý hovorí:\r\n-Raz som prišiel domov do môjho bytu na 7. poschodí a zbadal som na stole nedopité víno a v posteli ležala manželka nahá. Hneď mi bolo jasné, o čo ide, a tak som začal všetko prehľadávať. Nevedel som toho hajzla nikde nájsť, keď tu zrazu zbadám na balkóne prsty na zábradlí. Vyjdem na balkón a vidím ako tam tá sviňa visí. Zobral som kladivo a klepol som mu po nich celou silou. Ale dole niekto nechal starú posteľ, tak padol pekne do mäkka. A ešte mi aj kýval, tak som dotlačil chladničku na balkón a zhodil som ju na neho. Hurá, zabil som ho. A ako som sa vracal do bytu, potkol som sa a napichol som sa na tú ostrú časť kladiva.\r\nBoh sa spýtal toho druhého. Ten hovorí:\r\n-No ja som polieval kvety na balkóne na 11. poschodí mojej bytovky. Pri polievaní jedného ďalekého kvetináča som sa prevážil a prepadol cez zábradlie. Našťastie som sa zachytil na jednom poschodí, no tam ma tento debil zhodil. Dole som padol na starú posteľ, a keď som kýval, že som v poriadku, tak na mňa vyhodil 200-kilovú chladničku.\r\nBoh sa spýtal tretieho.\r\n-No ja som si tak raz sedel nahý v chladničke a...', 1237, 4.07, 25),
	(5846, 'Inzerát: Vymením 30-ročnú tehotnú za vrece múky. Zn.: kilo za kilo', 72, 3.75, 25),
	(5847, 'Doktor vyšetrí pani Novákovú a smutným hlasom hovorí jej manželovi:\r\n"Pán Novák, vaša žena je vážne chorá a nebude žiť dlhšie ako týždeň."\r\nPán Novák na to:\r\n"Pán Doktor, vydržal som to 20 rokov, tých sedem dní ma už nezabije."\r\n', 256, 3.98, 25),
	(5848, 'Manžel vkráča do izby za ženou  a vraví: "Žena, vidíš aké mám svaly? Vidíš tie vypracované lýtka, stehná? Sú pevné a silné ako dynamit...Žena na to: "No, to vidím, len tá zápalná šnúra je primalá..."', 225, 2.04, 25),
	(5849, 'Manžel príde domov z týždňovky, ľahne si do postele ku manželke a počíta nohy trčiace spod periny....123456Nejak mu to nesedí, a tak vstane z postele a počíta ešte raz....1234A povie si: No ved preto.."', 216, 4.19, 25),
	(5850, 'Ide manžel s manželkou na svadobnú cestu, idú okolo stáda kráv, manžel naň ukáže a povie: "Aha, pozri drahá, tam je tvoje rodina." Manželka sa nenechá odradiť a odpovedá: "Áno zlatko, moja svokra." Manželka ukáže na jednu z kráv a hovorí: "Pozri, tam je, vidíš ju?!"', 289, 3.13, 25),
	(5851, '- Včera sme sa s manželkou hrozne pohádali, ale na koniec sa priplazila po kolenách.\r\n- Hej? A čo hovorila?\r\n- Vylez spod toho gauča, ty zbabelec!', 152, 3.76, 25),
	(5852, 'Žena príde ráno domov a povie mužovi, že spala u najlepšej kamarátky. Čo urobí muž? Obvolá tých desať kamarátiek a zistí, že ani u jednej nespala.\r\nMuž príde ráno domov a povie žene, že spal u najlepšieho kamaráta. Čo urobí žena? Obvolá tých desať kamarátov a zistí, že u ôsmich prespal a u dvoch ešte stále je.', 346, 4.05, 25),
	(5853, 'Ráno sa muž zobudí po strašnej opici. Hrozne ho bolí hlava, za pohár vody by dal poklad a zo včerajšieho večera si vôbec na nič nespomína. Zašmátra vedľa seba na posteli rukou a manželky nikde. Otvorí oči a na poduške lístok: "Za chvíľu prídem, miláčik, milujem ťa!"\r\nVstane, ide do kuchyne a tam už pripravené raňajky, čerstvé pečivo, horúca káva, praženica, slaninka a opäť odkaz: "Dobre ráno, ľúbim ťa!"\r\nNechápavo pokrúti hlavou, ale stále si nemôže spomenúť. Vbehne do obývačky a tam jeho syn. Tak spýta:\r\n- Čo sa tu včera stalo?\r\n- Ale, prišiel si domov napitý ako sviňa, ten monokel máš od stolíka, keď si prepadol cez prah dverí, potom si ovracal celú chodbu a nakoniec aj seba.\r\n- No dobre, ale to nevysvetľuje čo sa tu stalo...\r\n- Nakoniec sa mama rozhodla, že ťa vezme do kúpeľne, aby si sa umyl a ty si pri tom začal vykrikovať: Pozor, ruky preč ženská, ja som šťastne ženatý!', 965, 4.29, 25),
	(5854, '- Mária, dnes ťa pomilujem na smrť - povie manžel, sadne si k televízoru a zaspí.\r\n- Tak čo? - budí ho žena? Bude niečo?\r\n- Vieš čo, darujem ti život...', 165, 3.43, 25),
	(5855, 'Rozprávajú sa dve priateľky:- Môj drahý mi sľúbil, že ak budem v posteli výborná dostanem Mercedes.\r\nAk budem dobrá dostanem Audi a ak budem priemerná dostanem Opel.- A čo si dostala?- Kolieskové korčule. ', 220, 3.86, 25),
	(5856, 'Opitý manžel príde neskoro domova a potichu sa vkráda do postele. "Starý, koľko je hodín?" - pýta sa zrazu rozospatá manželka."Jedna," - odpovedá muž.Vtom kukučkové hodiny odkukajú štyri. Manžel sa nahnevane obráti k hodinám a hovorí: "Vieme, vieme, že je jedna! Nemusíš to štyrikrát opakovať!"', 320, 3.87, 25),
	(5857, 'Manželka hovorí svojmu opitému mužovi:\r\n"Ty všetko prepiješ, a keď zomriem tak som zvedavá za čo mi zaplatíš pohreb!"\r\nA manžel jej povie:  "No vidíš, ale najlepšie by bolo, keby ťa dačo zožralo."', 214, 4, 25),
	(5858, 'Prídu manželia do reštaurácie.\r\nHostinský sa pýta paničky: -Čo budete jesť?\r\n- Párky.\r\n- Aj chren?\r\n- Áno, aj chren si dá párky.', 141, 3.95, 25),
	(5859, 'Nadpis na náhrobnom kameni:\r\nTu leží moja manželka a ja doma odpočívam v pokoji!', 86, 3.73, 25),
	(5860, 'Hovorí manželka manželovi: - Ty si ako komár. Celý život mi piješ krv, a keď ma picháš, tak by ťa človek zabil!', 123, 3.43, 25),
	(5861, 'Manžel príde znudený domov.\r\nŽena na neho: "A tebe sa čo stalo?"\r\n"Ále, len tak som si podal športku a vyhral som prvú cenu..."\r\nManželka vyhúkne radosťou: "Ty bláho, tak z čoho si taký nanič? Čo podnikneme?"\r\nOn: "Ja neviem, obleč si nejaké šaty."\r\nManželka uteká do šatníka a radostne pred neho prinesie šaty a pýta sa: "Mám si vziať tie modré, alebo tie čierne?"\r\nManžel znudene pozrie k nej a s nádychom odpovie: "Pre mňa-za mňa si zober všetky, ale hlavne už vypadni!"', 508, 3.28, 25),
	(5862, '"Dobrý deň som únosca vašej ženy. Ak zavoláte políciu alebo zložíte už ju nikdy neuvidíte."Tú...Tú...Tú...', 120, 3.64, 25),
	(5863, 'Tri najväčšie klamstvá na svete:\r\n1. Budem ťa milovať celý život.\r\n2. Budem ti verný celý život.\r\n3. Vašu faktúru uhradíme hneď zajtra.\r\n ', 153, 3.41, 25),
	(5864, 'Príde Fero neskoro večer domov a zistí, že jeho manželka kúpila novú varechu. Pristúpi k nej, prehne si ju cez koleno, rýchlo jej vyhrnie nočnú košeľu a začne ju silno udierať tou varechou na holý zadok.\r\n“Au, to bolí, auu, prestaň, auuu, hrozne to štípe, aauuuu, prosím už dosť, auuuu,“ narieka a kope nohami do vzduchu drahá polovička, pričom po tvári sa jej od bolesti kotúľajú horúce slzy.\r\nManžela však neobmäkčí hlasný plač ani červené klobásky s čerstvými modrinami na manželkinom bitom zadočku a na vysvetlenie práve prebiehajúceho poriadneho výprasku dodá: „ No je toto vôbec normálne? Tak doma neostala ani kvapka alkoholu, ale hlavná vec, že milostivá si nakupuje nový nábytok!“\r\n', 755, 2.67, 25),
	(5865, 'ONA se dívá na pořad o vaření. \r\nON říká: "To stejně nebudeš umět uvařit...\r\nONA na to: "No a co, ty se taky díváš na porno..." \r\n', 145, 3.82, 25),
	(5866, 'Ležia manželia v posteli a manžel šepká manželke:\r" Miláčik nemám slipy.,, Manželka mu poloospalo odpovie. " Zajtra ti nejaké vyperiem.,,', 148, 4, 25),
	(5867, 'Žena vraví mužovi: „Miláčik, skoč mi prosím ťa do drogérie kúpiť tampóny.“\r\nManžel hovorí: „Jasné zlatko.“\r\nManžel ide do drogérie a vypýta si vatové tyčinky. Potom ide do lekárne a vypýta si balíček gazy. Príde domov a položí nákup manželke na stôl. Manželka začne hysterčiť a nadávať manželovi, že prečo jej nekúpil tampóny.\r\nManžel sa len pohodlne usadí do sedačky, otvorí pivo a vraví: „Prestaň kričať, ja som ťa tiež minule poslal po cigarety a priniesla si mi tabak a dutinky, že to je lacnejšie a mám si ich našúlať. Tak si ich našúlaj aj ty, je to lacnejšie.“\r\n', 641, 4.27, 25),
	(5868, 'Manželka sa pýta manžela: "Prečo, keď spievam, stojíš pri okne?""Aby si ľudia nemysleli, že ťa bijemô - odpovedá manžel.', 133, 4.07, 25),
	(5869, 'Príde dedko k lekárovi s prosbou, či by mu nemohol doporučiť nejakú medicínu, že budú mať s babkou 60-te výročie sobáša a chceli by mať ešte aspoň raz sex ako keď boli mladí.\r\nDoktor sa zamyslí a vraví: „Dedko, v tomto zlatom staniole bude tabletka pre vás a v tomto striebornom staniole pre babku.“\r\nPo čase doktor stretne dedka a pýta sa ho ako výročie dopadlo. Dedko celý nešťastný vraví: „Pán doktor, ja som určite tie tabletky zamenil, lebo mne stále zadok otváralo a babke celý as nohu šponovalo.“\r\n', 550, 3.11, 25),
	(5870, 'Manželka po dvoch rokoch manželstva povie manželovi: "Musím sa ti s niečím priznať,som farboslepá."\r\nMuž jej odpovie: "Aj ja sa ti s niečím musím priznať,som černoch."', 181, 3.97, 25),
	(5871, 'Pribehne žena na policajnú stanicu a zúfalo hovorí: "Zabila som KOHÚTA, zabila som KOHÚTA!" \r\n"Ale pani,"odpovedá policajt, "to predsa nie je žiaden zločin." "Ale vy to nechápete," nedá sa žena odbiť, "ja som zabila KOHÚTA!" \r\n"No dobre teda," hovorí rezignovane policajt, "aké je vaše meno?" "Kohútová."\r\n', 325, 3.87, 25),
	(5872, 'V pôrodnici čakajú traja budúci oteckovia. Vyjde sestra a hovorí prvému, že sa mu narodili dvojičky.\r\n"To som čakal, my sme so ženou tesne pred počatím boli v kine na filme Dvojtý zásah."\r\n"A tu pánovi Kowalskému sa narodili trojčatá," oznamuje sestrička.\r\n"Uf, to bude tým, že sme so ženou boli na Troch mušketieroch."\r\nV tú chvíľu sa budúcí tretí otecko začne potiť. Ostatní sa ho pýtajú:\r\n"A čo vy, prečo sa tak potíte, je vám niečo?"\r\n"My sme so ženou boli na filme Dvanásť opíc."', 527, 4.28, 25),
	(5873, '"Ó,drahý,aký romantický večer pri sviečkach..."\r"Ale kdeže!Nezaplatili sme elektrinu,tak nás odpojili!"', 111, 4.22, 25),
	(5874, 'Manželka sa v noci zobudí na to ako sa manžel nervózne prechádza.\r\nČo ti je? - pýta sa.\r\nNo, mám strašnú chuť na sex. - odpovedá manžel.\r\nDrahý som ti k dispozícii... \r\nNeboj..., to rozchodím. - odpovedá muž.', 226, 3.76, 25),
	(5875, 'Stretnú sa dve kamáratky a rozprávajú sa.\r\n- Rozviedla som sa.\r\n- Ale nevrav.\r\n- Teraz sa súdime len o deti. Ani on ich nechce...', 134, 3.24, 25),
	(5876, 'Chlapík sa vráti domov totálne opitý, sadne si v kuchyni a z celej sily treskne po stole:\r\n- "Kto je tu pánom?" zreve.\r\nV tom príde jeho žena s tĺčikom na mäso a udrie ho po hlave. Muž zvesí hlavu a vraví:\r\n- "A to sa už nemôžem ani opýtať, či čo?"', 268, 3.79, 25),
	(5877, 'Leží muž na smrteľnej posteli a hovorí svojej manželke:\r\nDrahá, keď nám horel dom, stála si pri mne.\r\nKeď som mal cukrovku, stála si pri mne.\r\nA keď nás vykradli, stála si pri mne.\r\nTak si tak hovorím, či mi ty krava nenosíš smolu...', 252, 4.2, 25),
	(5878, 'Idú dvaja rozhádaní manželia v aute a na lúke uvidia kravy. Manžel hovorí žene: "Aha, na lúke sa pasú tvoji príbuzní."\r\nA žena mu odpovie: "Áno, svokrovci."\r\n', 172, 4.25, 25),
	(5879, 'Žena sa v noci zobudí a prebudí svojho manžela:\r- Miláčik, chcela by som sa milovať.\r- A to ti mám teraz v noci koho zohnať?', 133, 4.2, 25),
	(5880, 'Základné pravidlá pre šťastné manželstvo:\r1. Žena má vždy pravdu!\r2. Ak náhodou nemá, platí pravidlo č. 1.', 120, 3.98, 25),
	(5881, 'Sťažuje sa Jožko mame: \r\n- Mami, všetci v škole sa mi vysmievajú pre moju tmavšiu pleť.\r\n- Jaj, to ti bola taká párty, že môžeš byť rád, že neštekáš!', 169, 3.89, 26),
	(5882, 'Malý prváčik ide po prvý raz do školy. Mama sa ho pýta:\r\n- Máš všetko? Peniaze, mobil, kreditku?\n', 106, 3.4, 26),
	(5883, 'Dementný syn príde k otcovi a vraví : \r\n- Oci, daj mi 50 korún, chcel by som ísť na kolotoče!\r\n- Žiadne kolotoče, vieš dobre, že zaostávaš za priemerom! Potrebuješ sa učiť, takže si konečne zober otvárač a otvor si nejakú knižku!', 251, 3.49, 26),
	(5884, 'Matka hovorí svojej dospievajúcej štrnásťročnej dcére:\r\n- Mali by sme sa o niektorých veciach vážne poradiť.\r\n- A čo chceš vedieť, mami?', 150, 2.97, 26),
	(5885, 'Muž na cintoríne sa pýta dvoch ľudí: \r\n"Čo tu robíte takto v noci?" \r\n"No, zajtra ideme na dovolenku, tak ideme dať deti k našim.', 138, 3.25, 26),
	(5886, '- Pani Nováková, počula som, že u vás horelo. \r\n- Máte pravdu, zhorel môj muž aj s deťmi, ale našťastie sme boli poistený.\r\n- A vám sa nič nestalo? \r\n- Ale iba ma bolí zápästie. \r\n- Ale, a z čoho? \r\n- No z toho, ako som niesla ten ťažký kanister a potom ako som držala kľučku aby nik neušiel.', 317, 3.43, 26),
	(5887, 'Ide dcéra na diskotéku a matka sa jej pýta: \r\n- Prečo si si pod sukňu nedala nohavičky?\r\n- Ale, mama, ty keď ideš na koncert, dávaš si vatu do uší?', 159, 3.31, 26),
	(5888, '- Hej pani, koľko musím mať detí, aby som brala 30000 podpory? \r\n- Dvanásť. \r\n- Jooj, ...to aby som tri utopila!', 118, 3.06, 26),
	(5889, 'Narieka mafiánska matka nad svojim synom:\r\n- Čo len z teba bude? Otec je postrachom celého podsvetia, ja som bola desať rokov vo väzení a ty prinesieš zo školy jednotku zo správania!!!', 193, 3.2, 26),
	(5890, 'Rozprávajú sa dve ženy: \r\n- A čo vaša dcéra?\r\n- Moja dcérenka! Aká je šťastná! Má takého úžasného manžela! Dal jej auto, šperky na aké si spomenula, množstvo služobníctva. Raňajky jej nosí do postele a ona si potom leží až do obeda. Aký vzácny muž!\r\n- A váš syn?\r\n- Ach, chudák chlapec! Zobral si peknú fúriu! Dal jej auto, šperky aké si zmyslela a armádu služobníctva. Nevstáva skôr ako pred obedom! Nevstane ani preto, aby mu urobila raňajky!', 487, 3.08, 26),
	(5891, 'Synček sa pýta mamičky.\r\n- Mami, čo je to kamzík?\r\n- Sprostá ryba.\r\n- A prečo skáče po skalách?\r\n- Vidíš, aká je sprostá!', 135, 3.15, 26),
	(5892, 'Janko sa pýta mami: \r\n- Je to pravda, že som sa narodil o polnoci?\r\n- Áno, miláčik. \r\n- Dúfam, že som ta nezobudil - ustarostene vraví syn.', 147, 3.23, 26),
	(5893, '- Otecko, má had chvost? \r\n- Hmm, iba chvost.', 46, 3.16, 26),
	(5894, 'Domovník búcha na dvere a hovorí:\r\n- Pani Smithová, vašu dcéru zrazil parný valec!\r\nSmithová na to:\r\n- Teraz sa sprchujem, podstrčte mi ju pod dvere!', 158, 3.47, 26),
	(5895, 'Otecko vysvetľuje synovi záporne čísla:\r\n"V autobuse idú 4 ludia."\r\n"Vystúpia 6."\r\n"Koľko ich ma nastúpiť,aby bol autobus prázdny?"', 141, 3.26, 26),
	(5896, 'Malý braček sa pýta veľkej sestry: \r\n- Sestrička, čo máš v tom bruchu? \r\nSestra odpovedá: \r\n- Dieťatko. \r\nBrat sa pýta: \r\n- A máš ho rada? \r\n- No jasné. \r\n- Tak prečo si ho zjedla? \n', 197, 3.23, 26),
	(5897, 'zveruje sa matka dcére so svojimi obavami:\r\n- Nerada vidím tie tvoje výlety s Robertom na motocykli. Môže ťa zaviesť niekam do lesa, tam bude chcieť po tebe ktoviečo a keď mu nevyhovieš, nechá ťa ísť domov pešo...\r\n- Ale mami, prišla som snáď už niekedy domov pešo?', 286, 3.19, 26),
	(5898, 'Ide mamička so synčekom na metematickú súťaž, leže synček má menšiu telesnú vadu. Má 4 ruky a 6 nôh. Keď sú na železničnej stanici, chlapček ide na záchod. Zrazu sa ozve veľký krik a zo záchodov vybehne údržbár a hovorí:\r\n"Zažil som už všeličo, ale takého veľkého hajzlového pavúka som ešte nezabil."', 336, 3.6, 26),
	(5899, 'Dcéra: \r\n- Mami, mami, našla som dedka.\r\nMama: \r\n- Koľkokrát ti mám hovoriť, aby si sa nehrabala v záhrade.', 114, 3.68, 26),
	(5900, '- Mami, keď vyrastiem, dostanem takého muža, ako je otecko?\r\n- Určite, zlatko.\r\n- A keď sa nevydám, bude zo mňa taká stará dievka, ako teta Betka?\r\n- Možno aj horšia.\r\n- No, to som v peknej kaši.  ', 209, 3.16, 26),
	(5901, 'Matka kričí na svoju desaťročnú dcéru:\r\n"Fajčila si moje cigarety?"\r\n"Áno ale iba dve."\r\n"Tak za trest pôjdeš dnes spať bez koňaku."', 144, 3.55, 26),
	(5902, '- Ocko, dnes mám narodeniny. Čo dostanem?\r\n- Po hube, synak, po hube.', 71, 3.08, 26),
	(5903, '- Mami, dnes sa mi snívalo o Zuzke.\r\n- To nič, synček, ja ti to vyperiem.\n', 77, 3.21, 26),
	(5904, 'Osemnásť ročná Lenka príde podránom domov. Vo dverách ju už čaká nahnevaná matka:\r\n- Kde si bola doteraz? Ja keď som bola v tvojom veku...\r\n- Tak som už mala pol roka. \r\nPreruší ju s úsmevom dcéra.', 214, 3.35, 26),
	(5905, 'Matka priviedla dospievajúceho syna k doktorovi:\r\n"Pán doktor, pozrite sa čo sa môjmu synovi stalo s cikáčikom."\r\nDoktor chvíľu vyšetruje a hovorí:\r\n"Pani, odo dneška nebudete tomu hovoriť \'cikáčik\', ale pohlavný úd a bude ho liečiť na syfilis."', 263, 3.29, 26),
	(5906, 'Mama kričí na svoju desaťročnú dcéru: \r\n- Zase si mi zobrala cigarety? Priznaj sa!\r\n- Mami, ja len dve - hovorí vystrašená dcéra.\r\n- Za trest - hovorí matka - pôjdeš spať bez poldecáku.', 200, 3.01, 26),
	(5907, 'Pýta sa matka 10 ročnej dcéry:\r\n- Ty si mi vyfajčila cigarety?\r\n- Ano, ale iba dve.\r\n- Za to dnes večer nedostaneš koňak.', 128, 2.96, 26),
	(5908, '- Mami, mami, prečo je tá voda taká horúca?\r\n- A čo si si myslel, že ťa idem jesť surového?', 100, 3.11, 26),
	(5909, '- Jožko, už  som  ti vravela, že sa nemáš hrať so zápalkami.\r\n- Mami, ja som sa nehral, ja som si chcel zapáliť cigaretu.', 130, 3.17, 26),
	(5910, '- Mami, mami, ja som lietadlo...\r\n- Tak vyskoč z okna a nelietaj po byte.', 74, 3.2, 26),
	(5911, 'Príde matka s dcérou k lekárovi:\r\n- Pán doktor, len sa pozrite, od rana má nejaké veľké oči...\r\n- Mno, tak skúsime najprv povoliť gumičku vo vlasoch.', 161, 3.17, 26),
	(5912, 'Mama hovorí ráno svojmu synovi:\r\n"Vezmi si čistú spodnú bielizeň, čo keby ťa zrazilo auto?"', 99, 3.21, 26),
	(5913, 'Matka sa pýta dcéry, ktorá začala pracovať ako sekretárka:\r\n- A neobťažuje ťa šéf?\r\nDcéra sa usmeje: \r\n- Nie, mamička. Ja mám sex rada.', 149, 3.67, 26),
	(5914, 'Chcel by som dať zahrať pesničku svojej 70 - ročnej babke, ktorá je na psychiatrickom liečení: "Keď sa Vám raz baba tiež zblázni".', 141, 3.1, 26),
	(5915, 'Bohatá žena z vyššej spoločnosti, matka sedemnásťročnej dcéry, sleduje s obavami svoju sedemnásťročnú dcéru, až dospeje k presvedčeniu, že dcéra sa s niekým tajne schádza a dokonca, že už má za sebou aj sexuálne skúsenosti. V obavách o ohrozenie rodinnej povesti, sa rozhodne vec prediskutovať s rodinným lekárom:\r\n- Viete, dnešní mladí ľudia si užívajú život plnými dúškami - hovorí doktor, - akákoľvek snaha o to, aby ste zamedzili tým schôdzkam, by vyvolala len rebéliu a bola by kontraproduktívna. Navrhujem Vám, aby ste sa s dcérou porozprávali a navrhli jej, aby začala používať antikoncepciu, a dovtedy jej aspoň dali krabičku kondómov.\r\nNeskôr v ten istý večer, ako sa dcéra pripravovala na schôdzku, jej matka vysvetlila situáciu a nakoniec jej podala krabičku kondómov. Dievčina sa úprimne rozosmiala, položila mame ruku na plece a hovorí jej:\r\n- Ah, mami! Nemusíš mať vôbec starosti. Ja sa predsa schádzam so ženou!', 1001, 3.21, 26),
	(5916, 'Povída matka synovi:\r\n- Matka se musí pro své dítě obětovat, milý synu. Kdybych si nedokázala odtrhnout od ust, tak bys tu nikdy nebyl.', 143, 3.41, 26),
	(5917, 'Ide otec s dcérkou okolo obchodu s topánkami. Dcérka:\r\n- Oci, kúp mi tieto topánky!\r\n- Buď ticho a najprv znos korčule!', 126, 3.11, 26),
	(5918, 'Mala Marienka príde do kuchyne a pri chladničke vidí stáť holého chlapa!\r\n- Vy ste nový Babysitter?\r\n- Nie, ja som váš nový mother - fucker.', 150, 3.54, 26),
	(5919, 'Príde pani s dieťaťom k doktorovi. Ten si dieťa prezrie a potom povie matke: "Vyzlečte sa!"\r\nMatka sa zdesene diví: "Prečo? Choré je dieťa, nie ja!"\r\n"Toto je odpísané, urobím Vám nové!"', 200, 3.58, 26),
	(5920, 'John pozval svoju mamu na večeru. Počas jedenia si jeho mama nemohla\r\nnevšimnúť, že jeho spolubývajúca Júlia je veľmi pekná. Už dávnejšie mala  podozrenie, že John má vzťah so svojou spolubývajúcou a teraz bola ešte  zvedavejšia.\r\nPočas večera, keď sledovala ich reakcie, bola zvedavá, či je medzi\r\nJohnom  a jeho spolubývajúcou niečo viac ako len pohľady. Akoby čítal mamine  myšlienky, John povedal:\r\n"Ja viem, čo si musíš myslieť, ale môžem ťa uistiť, že Júlia a ja sme iba  spolubývajúci."\r\nAsi o týždeň neskôr prišla Júlia za Johnom a hovorí:\r\n"Odvtedy, ako tu bola tvoja mama na večeru, nemôžem nájsť tú krásnu\r\nstriebornú naberačku na omáčku. Nemyslíš, že ju zobrala, však?"\r\nJohn povedal:\r\n"Nuž, pochybujem o tom, ale pre istotu jej napíšem."\r\nTak si sadol za stôl a napísal:\r\n"Milá mama, ja nehovorím, že si zobrala naberačku na omáčku z môjho domu a  nehovorím ani, že si ju nezobrala. Faktom však zostáva, že chýba odkedy si  tu bola na večeri. S láskou John."\r\nO pár dní neskôr dostal John list od svojej mamy a v ňom bolo:\r\n"Drahý syn, ja nehovorím, že spíš s Júliou a nehovorím ani, že s ňou\r\nnespíš. Faktom však zostáva, že keby spala vo svojej vlastnej posteli, tak  by už dávno nasla naberačku na omáčku. S láskou mama." ', 1349, 3.71, 26),
	(5921, 'Vaša mačka je zdravá, lebo papá Whiskas. Váš pes je zdravý, lebo je Pedigree. Jedzte Vaše psy a mačky. Odporúčané rómskymi chovateľmi.', 148, 3.14, 27),
	(5922, 'Otázka na futbale v Dunajskej Strede:\r\n- Vedieme?\r\n- Vedieme a vedieť budeme!', 79, 3.39, 27),
	(5923, 'Slovenský maďar sa zamestnal u deratizačnej firmy. Príde k dverám, zazvoní a hovorí: ň\r\n- Hľadám myša.\r\n- Ktorého Miša? Zuzinho brata?\r\n- Nem Zuzin brat, ale potkanov sestra.', 187, 3.73, 27),
	(5924, 'Príde smädný vietnamec do slovenského baru, postaví sa k pultu a hovorí:\r\n"Ting jang won tian coca cola."\r\nBarman sa otočí a spýta sa: \r\n"Dva deci čoho?"', 163, 3.39, 27),
	(5925, 'Ste tu všetci Slováci?\r\nIgen.\r\nA koľko vás je?\r\nHárom', 58, 3.27, 27),
	(5926, 'Starý Levy leží na smrtelnej posteli, celá rodina pri ňom a on sa začal pýtať.\r\n- Si tu Roza?\r\n- Áno, môj milý.\r\n- Abe?\r\n- Áno otec.\r\n- Lew?\r\n- Samozrejme, otec.\r\n- Albert?\r\n- Áno otec, sme tu všetci.\r\nLevy vyskočil s postele a skríkne. \r\n- Tak potom kto dáva pozor na obchd?', 292, 3.07, 27),
	(5927, 'Skíni chytia cigáňa a dajú mu možnosť, budeš hadzať kockou, keď hodíš od 1 do 5 tak ťa zabijeme! Cigáň sa pýta:\r\n"A keď hodím 6?"\r\n"Tak budeš hádzať ešte raz."', 180, 3.42, 27),
	(5928, '"Cigáň, zahreš!"\r\n"Robota!"', 30, 3.18, 27),
	(5929, 'Ide Francúz a cigáň.Francúz zdvihne slimáka,priloží si ulitu k ústam, cucne, pohladká sa po bruchu a povie dobre,dobre a takto sa to opakuje niekoľko krát.Cigáň hladný naňho pozerá.Zodvihne aj on \r\nslimáka, cucne a nič, zase cucne a nič.Pozrie sa do ulity a tam slimák roztiahnutý , rukami,nohami sa drží o ulitu a kričí:\r\n"Fajči , fajči."', 366, 3.07, 27),
	(5930, 'Jeden róm hovorí druhému:\r\n- Hej Dežo, vedel si, že tvoja žena má dedičnú chorobu?\r\n- Sviňa jedna! A ani mi nepovedala, že dedila!', 141, 3.16, 27),
	(5931, 'Ázijský turista je na dovolenke v Európe.Príde do bazáru a tam sa rozhliada čo by si tak kúpil na pamiatku domov.Príde k nemu predavač a ponúka mu všakovaké veci.Zrazu sa turistovi rozžiari tvár a povie:\r\n"Zobral by som ten kríž, ale toho artistu mi odtiaľ zveste."', 282, 3.19, 27),
	(5932, 'Číňan príde po prvý raz do európskej reštaurácie. Čašník mu donesie zemiaky. Číňan si zašomre:\r\n- Fíha, aká veľká ryža.', 139, 3.19, 27),
	(5933, 'Viete, ako sa maďarsky povie včela? \r\nSeremed. \r\nA osa? \r\nNemseremed. \r\nA čmeliak? \r\nNemseremed turbo.\r\nSršeň?\r\nNemseremed turbo aggresiv.', 143, 3.65, 27),
	(5934, 'v ruskom vezení sa rozpráva  Kazachstanec, Azerbajdžanec a Bielorus.Kazachstanec hovorí Azerbajdžancovi:\r\n"Nie si hladný?"\r\n"Aj hej."\r\nKazachstanec sa porozpráva s personálom a o chvíľu prinesú kura.Azerbajdžanec sa naje.Bielorus ho varuje:\r\n"Kazachstanec ti nič nedá zadarmo,určite ťa bude chcieť pretiahňuť."\r\n"Ale však som sa najedol, snáď sa ubránim."\r\n"A nechceš piť?"\r\n"Nuž.Aj by som si dal."\r\nKazachstanec sa porozpráva s personálom a za chvíľu donesú pivo.\r\nA zase ho Bielorus varuje.\r\n"On ti nedá nič zadarmo, určite ťa bude chcieť pretiahňuť.Však som sa aj napil,sili som načerpal,tak sa určite ubránim."\r\n"Najedol si sa?"\r\n"Najedol."\r\n"Napil si sa?"\r\n"Ba aj som sa napil."\r\n"A sili si nabral?"\r\n"Nabral,ale prečo sa pýtaš?"\r\n"Pod sem !Podržiš mi Bielorusa."', 815, 3.43, 27),
	(5935, 'Súloží Cigáň Cigánku na zamrznutom Dunaji pod bratislavským mostom. Po každom prirazení sa mu Cigánka podšmykne. Po piatich minútach trápenia Cigáň zvolá:\r\n"Kireša drž sa, lebo Ťa tuším dosúložím až do Čierneho mora!"', 243, 3.03, 27),
	(5936, 'Pred nebeským súdom:\r\n- Vy do pekla, vy do neba, vy do neba, vy do pekla.\r\nNabehne cigánska rodina:\r\n- STOP! STOP! Vy do Fínska.', 132, 3.08, 27),
	(5937, 'Cigáň prechádza cez hranice a vtom ho zastavý colník.\r\n"Kam ideš cigáň?"\r\n"Teraz už akurát tak do zadku."', 115, 3, 27),
	(5938, 'Ide cigáň pri dialnici a stopuje.Zastaví mu skinhed \r\n"Ty ma odvezieš ?"\r\n"No jasnačka,ale niečo to bude stáť."\r\n"To je v poriadku."\r\n"Vieš hrýsť do tenisovej loptičky ?"\r\n"Hej."\r\n"Tak bež dozadu a hryzni."', 219, 3.07, 27),
	(5939, 'Čo povie cigáň, keď sa zľakne sovy?\r\n"Dik huuu."', 53, 3.2, 27),
	(5940, 'Hodina zemepisu v maďarskej škole na južnom Slovensku:\r\n- Lászlo, pozri na glóbus a povedz mi, čo to je os?\r\n- Os..., to je taký velký, páskovaný much!', 161, 3.78, 27),
	(5941, 'Ide cigáň po lese a zastrelí srnku.Stretne ho horár a hovorí:\r\n"Cigáň čo máš na ľavom pleci?"\r\n"Nič."\r\n"A na pravom?"\r\nCigáň pozrie a povie:\r\n"Dig aká to srnka prítulná na mojom pleci."', 202, 3.21, 27),
	(5942, 'Cigáňova žena pere pri rieke šaty a Dežo stojí nad ňou a prizerá sa, keď vtom ide po druhej strane SKINHEAD , hodí po cigánke kameň a zabije ju.Cigáň sa rozčuľuje a skinhead naňho kričí\r\n"Vodnej kámen to je převít ten vám rozbil pračku."', 261, 3.29, 27),
	(5943, 'Do baru v Prahe príde slováčisko, usadí sa a barman sa ho opýta :\r\n"Co si táde, pane?"\r\n"Whisky."\r\n"Scotskou?"\r\n"Nie, bez kocky!"', 135, 3.18, 27),
	(5944, 'Američan, Francúz a Rumun sú na služobnej ceste. Bavia sa o svojich ženách, či sú im neverné.\r\n"Ja mám na to špeciálny systém," hovorí Amík,"všade som nainštaloval minikamery a tak viem, či sa počas mojej neprítomnosti niečo dialo." "Ja na to idem cez voňavky," dodáva Francúz, "mám takú špeciálnu, pomocou ktorej hneď zistím, či bol s mojou ženou iný muž alebo nie." "Ja kašlem na techniku," smeje sa Rumun, "prvé čo urobím, keď prídem domov, je že zazvoním u susedky, ona otvorí dvere, ja sa jej podívam do očí a poviem:\r\n"Ty prostitútka!"\r\nOna sa vtedy totálne naštve a začne kričať:\r\n"Ja, ja že som prostitútka? Keby si ty vedel, čo robila tvoja žena kým si tu nebol"', 728, 3.4, 27),
	(5945, 'Viete čo sa stane, keď do vesmíru poletí prvý polský kozmonaut?\r\nNajprv zmizne Malý Voz, a potom Velký Voz.', 115, 3.21, 27),
	(5946, 'Príde maďarský občan k priepasti a zavolá do nej:\r\n"looooofaaas..."\r\nNič sa neozve tak podíde bližšie a zavolá:\r\n"looooofaaas..."\r\nZase nič, podíde ešte bližšie a spadne do nej a ako si tak padá začne kričať:\r\n"šegíčííííík..."\r\nA z priepasti sa ozve:\r\n"looooofaaas."', 293, 3.21, 27),
	(5947, '- Dežo, kde robíš?\r\n- Neprovokujte šéfko, nie sme v socializme.', 68, 3.12, 27),
	(5948, 'Príde chlap v Dunajskej Strede do autosalónu.\r\n"Dobrý déň, rád by som kupil nový auto."\r\n"A akú značku by ste si priali?"\r\n"To je jednóó, déé es céé, déé es déé."', 181, 2.97, 27),
	(5949, 'Stretne sa slovenský Maďar s maďarským Slovákom pred predajňnou modranskej majoliky. Pýta sa slovenský Maďar maďarského Slováka: \r\n"Tebe páči keramika?" \r\nA maďarský Slovák odpovedá:\r\n"Mne páči kerá nemyká."', 229, 3.29, 27),
	(5950, '"Ste tu všetci Slováci?"\r\n"Igen."', 35, 2.97, 27),
	(5951, '- Oký to ták, čo lúbi mad a robiť brum brum?\r\n- Já, to madmed!', 68, 3.08, 27),
	(5952, 'Oky volá ten malý zelený, od ktorý skapala Jánošík?\r\nHroch, nem?!', 72, 3.21, 27),
	(5953, 'Oko volá ten malý vták, čo sladká vazelína nosí a celofáné krídlo letí. \r\nČella.', 92, 3.45, 27),
	(5954, 'Oko volá ten veľká tvrdá žaba, čo neskáče, ale plážuje?   \r\nKorytnák.', 80, 3.31, 27),
	(5955, 'Turecký turista práši koberec z hotelového okna v Tatrách. Okolo ide bača a kričí:\r\n- Čo Aladin neštartuje?', 117, 3.64, 27),
	(5956, 'Príde Gejza na úrad a pýta sa:\r\n- Koľko musím mať detí, aby som dostal prídavky vo výške 30 000 Sk, dyk?\r\nA úradníčka mu hovorí:\r\n- No asi tak 30.\r\n- Joj, tak to sa musím ešte troch zbaviť.', 206, 3.22, 27),
	(5957, '"Žid ja ťa vidím, si za rúčkou hrablí, vylez!"\r\n"Nejdeme!"', 64, 3.39, 27),
	(5958, 'Príde maďar do zelovocu a chce si kúpiť hrach. A hovorí:\r\n- Eť kilo zelená bobula, na ktorom Jánošík rozbila papuľa.', 127, 3.37, 27),
	(5959, 'Príde Maďarka do kníhkupectva a hovorí predavačovi: \r\n- Máte také malé, nič písať, len obrázky a hrubé strany?\r\n- Aha, vy myslíte leporelo.\r\n- Áno. \r\nPo chvíli prezerania hovorí: \r\n- V maďarčine nemáte?', 222, 3.85, 27),
	(5960, 'Čo sa stane v roku 2006?\r\nRómovia nás uznajú za menšinu.', 61, 3.31, 27),
	(5961, '"Dau si konem?"\r\n"Dau"\r\n"A dost si im dau?"\r\n"Aaa, dost som im dau"\r\n"Sak si im ani nemusel tolko dat"\r\n"Sak som im ani tolko nedau"\r\n"A sak si im ani vobec nemusel dat"\r\n"A sak som im ani nedau"', 195, 3.15, 27),
	(5962, 'Ako nazývajú záhorácky homosexuály HOT - DOG ?\r\nBUZI - DUNČO.', 67, 3.56, 27),
	(5963, 'Ide záhorák po preplnenej bratislavskej ulici a narazí do veľmi nervózneho bratislavčana. Ten naňho zreve: \r\n- Ty debil!\r\nZáhorák sa naňho pozrie, zasmeje sa a hovorí: \r\n- Ná de bych biu! V Prióri!', 210, 3.14, 27),
	(5964, 'Záhorák je v Anglicku a rozbolia ho zuby.\r\nIde k zubárovi sadne do kresla, ukáže na zub a povie TU. Zubár-sadista mu v momente vytrhne 2 zuby. Večer sa Záhorák stretne s kamarátom a posťažuje sa mu, čo sa mu stalo.  On mu na to: \r\n"Jaaaj a ty nevieš, že po anglicky "TU" znamená dva? Preto ti vytrhol 2 zuby." \r\nPoučený Záhorák ide opäť k zubárovi, sadne do kresla, ukáže na zub a povie: \r\n"TEN."', 421, 3.51, 27),
	(5965, 'Išiel dedo na bicykli, prepadli ho zbojníci a hovoria mu:\r\n- Dedo, daj dušu alebo peniaze.\r\n- A kerú dušu? Prednú či zadnú?', 131, 3.55, 27),
	(5966, 'Viete prečo majú záhoráci tvrdé fašírky?\r\nLebo melú psa aj s búdou.', 76, 3.19, 27),
	(5967, 'Prečo dávajú záhoráci na noc rádio do mrazáku?\r\nAby mali ráno čerstvé správy.', 88, 2.91, 27),
	(5969, 'Viete, aký je rozdiel medzi Záhorákom a vibrátorom?\r\nVibrátor je len taká napodobenina, ale Záhorák je naozajstný...', 125, 3.19, 27),
	(5970, 'Kamaráti Fracek a Pišta sa stretli po dlhšej dobe:\r\n- Ahoj Francku, čo máš nové?\r\n- Ále, oženil sem se.\r\n- A keho sis zebral?\r\n- Panenku Máriu.\r\n- Čo? A nemáš náhodu fotku?\r\n- Mám.\r\n- Ukáž!\r\nPišta pozrie na fotku, chytí sa za čelo a zhrozený zreve:\r\n- Panenko Mária!', 288, 3.28, 27),
	(5971, 'Pýtajú sa Francka:\r\n- Francku, na jaká je tá tvoja stará.\r\n- Šak ste hu vidzeli, blondínka, celkem fešna ženská.\r\n- Ale my sceme vedzet jaká je v posteli.\r\n- Na co já vím, šak každý hovorí ináč!', 213, 3.26, 27),
	(5972, 'Ide mníška na bicykli po Záhorí a za ňou veje závoj a celé rúcho. Uvidí to záhoráčka, čo práve v záhrade okopáva, okamžite preskočí plot, rýľom udrie mníšku po chrbte. Mníška zostane ležať na zemi a záhoráčka hovorí:\r\n- Na, už dolítaus, Batman!', 277, 3.4, 27),
	(5973, 'Viete, ako prebiehalo osídľovanie Záhoria?\r\nZ helikoptéry. Kto dopadol na nohy, odišiel.', 93, 3.09, 27),
	(5974, 'Príde Záhorák do bordelu a pýta sa.\r\n"Honíte tu ko....kotú?"\r\n"Áno."\r\n"Tak mňa teda chicte!"', 100, 3.07, 27),
	(5975, 'Vo vlaku stretne Rus záhoráka a pýta sa ho:\r\n" Odkuda vy idiote?"\r\n"Ja idiot z Mauacek!"', 91, 3.19, 27),
	(5976, 'Na záhorí v miestnom rozhlase upozorňujú obyvateľov na miestnu slávnosť.\r\n- Občaná očúvajte. Ak bé pršať, oslava nebé. Ak nebé pršať, oslava bé. Opakujem. Ak bé, tak nebé, ak nebé, tak bé.', 211, 3.79, 27),
	(5977, 'Prečo sa záhoráci, keď idú z roboty v autobuse, všetci tlačia dopredu?\r\nAby boli skôr doma.', 99, 3.11, 27),
	(5978, 'Prečo záhoráci zakrývajú na noc studne?\r\nAby sa im v noci nevyliali.', 73, 2.89, 27),
	(5979, 'Viete prečo majú záhoráci pred garážou vykopanú jamu?\r\nKeď im skape motor, aby ho mali kam pochovať.', 109, 3, 27),
	(5980, 'Viete prečo záhoráci lížu hodiny?\r\nLebo TIC-TAC osviežuje dych.', 69, 3.16, 27),
	(5981, 'Ide mníška po ulici a vietor jej dvíha plášť. Cigán to vidi, Záhorák to vidí, schytí lopatu a uteká k mníške. Ovalí ju lopatou a vraví:\r\n"Dolítaus, Batmane!"', 174, 3.4, 27),
	(5982, 'Jurko sa pýta suseda:\r\n- Vaše kravy fajčia?\r\n- Nie, kdeže!\r\n- Tak potom vám horí stodola!', 95, 3.04, 27),
	(5983, 'Viete ako hnojí záhorák svoju záhradu?\r\nVystrčí zadok von oknom a povie:\r\n"Nááááá serem na teba !"', 109, 3.14, 27),
	(5984, 'Idú si tak dvaja muži do neba a jeden sa pýta druhého:\r\n"Prečo si zomrel?"\r\n"Vieš, prišiel som o deň skorej zo služobnej cesty a chcel som nachytať moju nevernú manželku. Pozriem do spálne-nič. Pozriem do kuchyne-nič. Do komory-nič. Do kúpeľne-nič. Tak som z tej veľkej radosti dostal porážku."\r\n"Vidíš ty idiot, keby si sa pozrel do chladničky, mohli sme obaja žiť!"', 394, 3.17, 27),
	(5985, 'Prečo Záhoráci vkladajú do chladničky aj prázdne fľaše?\r\nKeby náhodou prišiel na návštevu niekto, kto nepije.', 121, 3.28, 27),
	(5986, 'Po týždňovom pobyte vo Viedni sa Záhorák rozhodne, že si konečne kúpi poriadne cigarety. Tak vojde do prvého baru a hovorí:\r\n"Do you speak english?"\r\n"No, I don`t."\r\nVojde do druhého a zase sa pýta:\r\n"Do you speak english?"\r\n"No, I don`t."\r\nTak vojde do tretieho a hovorí:\r\n"Do you speak english?"\r\n"Yes, I do."\r\nZáhorák ukáže prstom a hovorí:\r\n"Marlboro!"', 374, 3.82, 27),
	(5987, 'Prídu záhoráci do Bratislavy a už na vstupe do mesta na konci dialnice sa stretávaju s prvým semafórom. Otec vodič zastaví a hovorí: \r\n"Aha deti svieti červená."  \r\nNo za chvíľku naskočí oranžová, potom zelená a zase červená. Na to otecko: \r\n"Môžeme ísť, to už sme videli!"', 299, 3.11, 27),
	(5988, 'Prečo si záhoráci stavajú dve studne?\r\nLebo v jednej majú teplú a v druhej studenú vodu.', 95, 3.19, 27),
	(5989, 'Prečo dávajú Záhoraci sliepkam jesť Granko?\r\nAby im znášali kindervajcia.', 80, 3.03, 27),
	(5990, 'Prečo somárom nesvietia oči? \r\nLebo Záhorie by bolo vysvietené ako Las Vegas.', 82, 3.37, 27),
	(5991, 'Čo vznikne spárením osla a korytnačky?\r\nZáhorák v prilbe.', 63, 3.17, 27),
	(5992, 'Prečo vrabci nad Záhorím lietajú hore bruchom?\r\nPretože sa už nemôžu na tých blbcov tam dolu ani pozerať!', 115, 3.21, 27),
	(5993, 'Na záhorskej svadbe prišlo náhle chlapíkovi nevoľno a rozbehol sa na záchod - typickú dedinskú drevenú latrínu. Keď dlho nechodil, vybrala sa za ním manželka a našla ho skloneného nad latrínou celého zababraného od hovna. \r\n"Čo to tu preboha robíš?" \r\n"Ale, ako som šabloval vypadla mi protéza!" \r\n"A to ju odvtedy hľadáš?" \r\n"Áno, už som našiel tri, avšak ani jedna mi nepasuje."', 410, 3.17, 27),
	(5994, 'Strýco sa pýta Janula:\r\n"Kam ideš, Janulo?" \r\n"Náá do rici, strýčku."\r\n"Múdri chvapec, nepoví, kam ide."', 113, 3.13, 27),
	(5995, 'Dvaja záhoráci prvý raz v živote vidia vodné lyžovanie a jeden z nich sa začudovane pýta:\r\n"Prečo ten čln tak uháňa?"\r\n"Čo nevidíš, že ho ten na lyžiach prenasleduje?"', 184, 2.86, 27),
	(5996, 'Na Záhorí v reštaurácii:\r\n- Tak čo to bude?\r\n- Prosím si jeden čaj.\r\n- Obyčajný alebo bez rumu?', 104, 3.15, 27),
	(5997, 'Ako povie záhorák svojej milej "Pozri miláčik, ako dnes krásne svieti mesiačik!"?\r\n"He, krava, he!"', 105, 3.41, 27),
	(5998, 'Akú prídavnú dopravnú značku majú záhoráci pred vjazdom do kruhového objazdu? \r\nLen 15 min.', 100, 3.39, 27),
	(5999, 'V kupé sedia oproti sebe dvaja muži. Jeden je Nemec, druhý nejaký záhorák. \r\nNemec si ho prezerá a zdá sa mu, že sa podobá na Betthovena. Tak mu hovorí.\r\n- Fiziráš jak Pethoven.\r\nZáhorák sa naštve a odpovedá mu:\r\n- A ty ako desať hoven, Nemec bláznivý.', 272, 3.55, 27),
	(6000, 'Príde Záhorák do drogérie a pýta si šampón. Predavačka hľadajúc pod pultom mu hovorí, že už asi nemajú, ale potom nájde a povie:\r\n- Máme tu ešte jeden vajcový. \r\n- Škoda, ja som si chcel umyť hlavu.', 218, 3.2, 27),
	(6001, 'Viete prečo záhoráci nosia igelitové trenky? \r\nLebo pod igelitom všetko lepšie rastie!', 92, 3.28, 27),
	(6002, 'Rádio: "Presný čas, o 10 minút bude 8 hodín."\r\nZáhorák: "Somári, co mňa je po tem, koľko bude za deset minut, mňa zaujímá kolko je fčil. " ', 153, 3.2, 27),
	(6003, 'Príde záhorák k lekárovi.\r\nLekár sa ho pýta:\r\n"Tak, pán pacient čo Vás bolí?"\r\nZáhorák len stiahne nohavice a ukáze lekárovi prirodzenie,kde má samé modriny. Lekár sa celý zhrozí a pýta sa ho:\r\n"Panebože a čo sa Vám stalo?!"\r\nA záhorák mu nato:\r\n"Ále, šeu sem s bratom na hríby a jak sme tak šli, unavení sme si lehli do trávy a zaspaui sme. Zrazô sa len tak zobudzím a táak zmija mi lézua do kalhót." \r\n"Panebože a to Vás tak doštípala", pýtal sa lekár.\r\nA záhorák nato:\r\n"Naščesci nescihua, lebo brat ju scihou lopatú umlácic!"', 577, 3.27, 27),
	(6004, 'Na futbalovom zápase na záhorí:\r\nIhrisko celé hrboľaté, v strede veľký kopec. Zrazu vyjde stoper na kopec a kričí na brankára:\r\n- Už idú!', 150, 3.27, 27),
	(6005, 'Záhorák príde do obchodu s TV.\r\n- Máte aj ferebné televízory?\r\n- Áno, aký chcete?\r\n- Ná žlutý.', 105, 3.34, 27),
	(6006, 'Ako hnoja Zahoráci záhradu?\r\nOtvoria okno a povedia:\r\n"Na,osratá si!"', 72, 3.04, 27),
	(6007, 'Viete prečo majú záhoráci pred domom dve studne?\r\nV jednej majú studenú a v druhej teplú vodu.', 101, 3.09, 27),
	(6008, 'Záhorák chytil zlatú rybku.\r\n"Prosím ťa, dobrý človek" - prosí zlatá rybka - "ak ma pustíš na slobodu, splním ti tri želania".\r\n"Ja mám len jedno želanie" - hovorí zlostne Záhorák - "aby si nemala žiadne kosti!!!"', 232, 3.34, 27),
	(6009, 'Viete, ako záhoráci dostanú muchu do úzkych? No predsa tak, že ju vyženú hore na povalu a zoberú jej rebrík.', 117, 3.07, 27),
	(6010, 'Ako sa povie windsurfing po záhorácky?\r\nUatečka s puachetkú.', 64, 3.68, 27),
	(6011, 'Ako sa povie po záhorácky majka z gurunu?\r\nNa jebua Mara z mračen.', 69, 3.4, 27),
	(6012, 'Prečo si záhoráci stavajú okrúhle domy?\r\nAby ich nikto neprepadol za rohom.', 80, 3.07, 27),
	(6013, 'Mladá slečna, Záhoráčka, príde za svojím otcom do nemocnice a pýta sa ho:\r\n"Tato, čo vám je?" \r\n"Prostata." \r\n"Tato, prosím vás, čo vám je?"\r\n"Prostata."\r\n"Tato, pekne vás prosím, čo vám je...?"', 212, 3.09, 27),
	(6014, 'Čo urobí Somálec, aby si mohol zalietať po byte?\r\nZapne fén.              ', 79, 3.8, 27),
	(6015, 'Rozprávajú sa dvaja arabskí šejkovia:\r\n"Nášmu Alimu sa zapáčili ženy športového typu. Zajtra sa žení s našim ženským basketbalovým tímom."              ', 170, 3.88, 27),
	(6016, 'Výpis zo súdneho protokolu:\r\n"Po ulici išiel dobrý, čestný Róm. Zrazu, z ničoho nič, pribehol k nemu zákerný dôchodca, napichol sa mu na nôž a vnútil mu svoju peňaženku."              ', 201, 4.15, 27),
	(6017, 'Škót posiela blahoželanie nasledujúceho znenia:\r\nVeselé Vianoce a šťastný Nový rok v rokoch 2006 až 2015 vám zasiela Ludvik.              ', 149, 3.93, 27),
	(6018, 'Janošík okradne miliardára a peniaze dá chudobnému starcovi. A starec vykrikne:\r\n"som bohatý!"\r\nVtom sa Janošík otočí a peniaze mu zobere.              ', 162, 3.8, 27),
	(6019, 'Záhorák chytí zlatú rybku.\r\n"Splním ti jedno želanie. Želaj si..."\r\n"Čo ja viem....hm... Aby si nemala kosti!"              ', 132, 3.94, 27),
	(6020, 'Viete prečo Cigáni nehrajú v Star treku?\r\nPretože sa s nimi do budúcnosti nepočíta.              ', 104, 4.09, 27),
	(6021, 'Hodina zemepisu v maďarskej škole na južnom Slovensku:\r\n"László, pozri na glóbus a povedz mi, čo to je os?"\r\n"Os..., to je taký veľký, páskovaný much!"              ', 177, 4.1, 27),
	(6022, 'Cigán bol na spovedi.\r\n"Tak čo," pýta sa ho druhý Cigán\r\n"dal ti  farár rozhrešenie?"\r\n"Nedal, ešte je v šoku."              ', 134, 3.93, 27),
	(6023, 'Študent zo Saudskej Arábie študujúci na Slovensku píše otcovi:\r\n"Otec, všetci na mňa čudne pozerajú, lebo všetci chodia do školy autobusmi, iba ja autom!"\r\nOtec:\r\n"Dobre, synak, posielam ti autobus!"\n', 212, 3.9, 27),
	(6024, 'Ide cigánka do taxika a Taxikár sa jej pýta: "Kde to bude?" \r\nCigánka: "Dik jaky zvedavý"              ', 108, 3.4, 27),
	(6025, '- Čo máš nového, Dežko?\r\n- Manželka mi zhorela pri požiari.\r\n- A nebolo možné ju zachrániť?\r\n- Keď tak sladko spala...              ', 144, 3.71, 27),
	(6026, 'Cigáň kradne drevo v hore. Ide okolo horár a kričí:\r\n- Cigán, čo kradneš to drevo?!\r\n- To je pre kravy.\r\n- Hej? A odkedy kravy žerú drevo?\r\n- Čo nezožerú, popálim.              ', 191, 4.2, 27),
	(6027, 'BLAHOŽELÁME:\r\nV našom žrebovaní ste vyhrali rómske dieťa. Vyzdvihnite si ho do 14 dní, inak vám pošleme celú rodinu.              ', 141, 3.95, 27),
	(6028, 'Ako sa po polsky povie šampón proti lupinám?\r\nPjona na glavu dľa odstranenja čipsov pačesowich.              ', 115, 3.85, 27),
	(6029, 'Malý černoško sa pýta svojej mamy belošky:\r\n- Prečo som ja čierny a ty biela?\r\nMama odpovedá:\r\n- Buď rád, že si černoch a nie pes, taký to bol vtedy žúr...              ', 184, 4.18, 27),
	(6030, 'Príde židovský syn za svojím otcom:\r\n- Oci, daj mi 5 korún."\r\n- Čo chces 4 koruny? Na čo Ti budú 3? Čo budeš robiť s dvoma? Tu máš korunu a rozdeľ sa s bratom.              ', 187, 3.63, 27),
	(6031, 'Príde kanibal do pôrodnice. Sestrička sa ho pýta:\r\n"Prajete si ho zabaliť, alebo ho zjete tu?"              ', 113, 3.88, 27),
	(6032, '- Dežo! Pozri, aká fajn kočka! Tá má aspoň 150 kíl. Šuchneš ju?\r\n- No dovoľ, čo som makrofil?              ', 118, 3.8, 27),
	(6033, 'Ide romčatko s mamou cez tržnicu a male romčatko sa pýta:\r\n"Mamo kúpiš mi cibuľu"\r\nA mama nato: \r\n"Sladké by si papal, čo!              ', 145, 3.82, 27),
	(6034, 'Slúžka našla pod posteľou prezervatív. Išla za svojou pani a hovorí jej:\r\n"Pani moja, toto som našla pod posteľou, čo je to?"\r\n"Ale Marta, čo vy sa na dedine nemilujete?"\r\n"Áno, ale nie až tak, aby kožka zišla..."              ', 242, 3.89, 27),
	(6035, 'Rómka leží v pôrodnici a lekár vyťahuje jedno dieťa za druhým...Prvé, druhé, tretie, štvrté,... \nPo piatom cigánka vezme decko do rúk a podáva ho doktorovi:"To je za robotu".              ', 203, 4.01, 27),
	(6036, 'Dvaja cigáni kradnú na stavbe a jeden spadne do vápna:\r\n-Čo budeme teraz robiť?\r\n-Jój, dyk, ešte len chvíľu si biely a už by si chcel robiť!              ', 165, 4.16, 27),
	(6037, 'Cigáň, zahreš!\r\n-Robota\n', 27, 3.4, 27),
	(6038, 'Oko volá ten malý zelený,\r\nod ktorý skapala Jánošík?\r\nHroch, nem?!              ', 87, 4, 27),
	(6039, 'Stretne sa slovenský Maďar s maďarským Slovákom pred predajňou modranskej majoliky. Pýta sa slovenský Maďar maďarského Slováka:\r\n"Tebe páči keramika?"\r\nA maďarský Slovák odpovedá:\r\n"Mne páči kerá nemyká."              ', 240, 4.11, 27),
	(6040, 'Mladá Záhoráčka príde za otcom do nemocnice: "Tata, čo je vám?"\r\n"Prostata." odpovedá otec.\r\n"Tata, prosím vás, čo vám je?"\r\n"Prostata."\r\n"Tata, veľmi pekne vás prosím, čo vám je?"              ', 211, 3.64, 27),
	(6041, 'Príde Maďarka do kníhkupectva a hovorí predavačovi:\r\n”Máte také malé, nič písať, len obrázky\r\na hrubé strany?”\r\n”Aha, vy myslíte leporelo.” hovorí predavač a jedno jej podá.\r\nPo chvíli prezerania ona hovorí:\r\n”A v maďarčine nemáte?”              ', 280, 3.42, 27),
	(6042, 'Sudca sa pýta Róma, prečo ukradol auto.\r\n”Viete, pán sudca, to auto stálo opustené pred cintorínom, tak som si myslel, že jeho majiteľ zomrel...”              ', 172, 4.14, 27),
	(6043, 'Dvaja Rómovia idu po moste a jeden číta nápis na ceduli: BIELY S GUMOU ZA 500 SK, RÓM BEZ GUMY ZA 100 SK. Druhý na to vraví: "To sa mi páči, žiadny rasizmus". Čo tam ešte píšu?" BANDŽÍ DŽAMPING.              ', 225, 3.92, 27),
	(6044, 'Do triedy príde Číňan a deťom povie:\r\n”Deti dávajte mi otázky.”\r\nV tom momente príde učiteľka k Mórickovi a povie mu:\r\n”Móricko, ty mu nesmieš dávať otázky, lebo otázky z tvojích úst sú neslušné!”\r\nUž sa blíži koniec hodiny, a práve vtedy si Číňan všimne Móricka a vraví mu:\r\n”Ty chlapec, tam vzadu, ty si sa ma ešte nič nepýtal, daj mi otázku!”\r\n”Ale ja nesmiem.”\r\n”Prečo by si nemohol? Daj mi otázku!”\r\n”No tak dobre. Koľko máte otcov?”\r\nČíňan si pomyslí: Blbá otázka, blbá odpoveď a vraví:\r\n”Šesť.”\r\n”Ja som vedel, že z dvoch vajec nemôžeš byť taký žltý!”              ', 663, 4.19, 27),
	(6045, 'Sedia dvaja cigáni na kope odpadkov. Jeden sa pýta:\r\n”Ty máš hlísty?”\r\n”Dyk, čo?” odvetí druhý. ”Zabudol si? Včera sme poslednú zjedli.”              ', 172, 3.83, 27),
	(6046, 'Viete aké tri najhoršie slová Vám môže povedať cigáň?\r\n"Dobrý deň sused."              ', 98, 3.75, 27),
	(6047, 'Starému Škótovi prišlo pozvanie na oslavu. Na pozvánke bolo napísané: ”Nápoje a jedlo sú grátis.” Keďže Škót neovládal cudzie jazyky, ostal radšej doma. Na druhý deň ho našli mŕtveho so slovníkom cudzích slov v ruke.               ', 257, 3.86, 27),
	(6048, 'Český turista zavíta na salaš, vidí baču s jeho rodinou, osem detí a vraví:\r\n”Báčo, a to jsou všechny vaše?”\r\nBača odpovedá:\r\n”Hej, však čie by mali byť!”\r\nČech na to:\r\n”No, to u nás máme len tak jedno, dve.”\r\nA bača:\r\n”Hej, a kto vás potom naondial, že sú vás plné Tatry?!”              ', 330, 4.21, 27),
	(6049, 'Príde chlap v Dunajskej Strede do autosalónu a vraví:\r\n”Dobrý déň, rád by som kúpil nový auto.”\r\n”A akú značku by ste si priali?”\r\n”To je jednóó, déé es céé, déé es déé.”              ', 217, 3.18, 27),
	(6050, 'Ide Záhorák autom a zastaví ho policajt. Pýta sa ho:\r\n”Pán vodič, viete akého dopravného priestupku ste sa dopustili?”\r\nZáhorák sa na policajta nechápavo pozrie a policajt pokračuje:\r\n”Prekročili ste plnú čiaru.”\r\nZáhorák sa usmeje a odvetí:\r\n”Ná co, co pukua?”              ', 306, 3.81, 27),
	(6051, 'Stretnú dvaja rómovia ďalšieho a ten sa ich pýta:\r\n”Dik more, kde idete?”\r\n”Ideme pomilovať našu Aranku!”\r\n”Dik more, môžem ísť s váma?”\r\n”Dik, jasné, že môžeš!”\r\nTak sa ich postupne nazbiera päťdesiat. Dôjdu k Aranke, otvorí jej mama a pýta sa:\r\n”Dik more, čo chcete?”\r\n”Teta, došli sme pomilovať vašu Aranku!”\r\n”Tak to si vyhodzte z hlavy, naša Aranka neni žádná štetka! Ideš len ty, ty a ty!”              ', 469, 4.19, 27),
	(6052, 'Zastaví sa primár pri lôžku pacienta, na ktorom leží muž s obviazanou hlavou a pýta sa:\r\n”Autonehoda?”\r\n”Nie, maharadža...”              ', 154, 3.86, 27),
	(6053, 'Dvaja rómovia nájdu samopal. Jeden hovorí:\r\n”Dik more, saxofón. Ja budem stláčať a ty fúkaj!”              ', 119, 4, 27),
	(6054, 'Malý Cigán vojde do drogérie a pýta si žuvačku. Predavač mu omylom predá petardu. Zistí svoj omyl, vybehne na ulicu a kričí:\r\n”Heej ty, počkaj!”\r\nCigán sa otočí a pukne od smiechu.               ', 214, 3.92, 27),
	(6055, 'Stretnú sa dvaja Rómovia a jeden hovorí druhému:\r\n”Oj, ale som uťahaný.”\r\n”A z čoho?”\r\n”Z roboty.”\r\n”Hej a kde robíš?”\r\n”Ta v kameňolome.”\r\n”Hej a od kedy?”\r\n”Ta od zajtra.”              ', 225, 4.04, 27),
	(6056, 'Náčelník sa pýta zajatcov:\r\n- Kto si?\r\n- Som prezident jednej veľkej krajiny. Čo mi môj ľud povie, to urobím.\r\n- Ako sa volá tá krajina?\r\n- USA.\r\n- Nepoznám, dajte ho do sviečkovej.\r\nNáčelník sa pýta Putina:\r\n- A ty si kto?\r\n- Som vodca jednej veľkej krajiny a čo poviem, to môj ľud urobí.\r\n- Aká je to krajina?\r\n- Rusko.\r\n- Nepoznám. Do guláša!\r\nNakoniec sa náčelník otočí na Schustera a pýta sa ho, kto je. On odpovedá:\r\n- Som prezident takej maličkej krajinky a čo nám ostatné štáty hovoria, tak to my robíme.\r\n- A ako sa to u vás volá?\r\n- Slovenská republika.\r\n- Jasné, poznám. Dáš si guláš alebo sviečkovú?              ', 676, 3.84, 27),
	(6057, 'Letia Slovák, Američan a Angličan lietadlom. Náhle začne horieť motor a oni majú len dva padáky. Prvého sa chytí Američan so slovami:\r\n- Ako príslušník najinteligentnejšieho národa mám právo sa zachrániť.\r\nAngličan sa s kľudom otočí na Slováka a vraví:\r\n- Mal by som síce právo skočiť, ale ako gentleman, prenechám padák vám. \r\nA Slovák vraví:\r\n- Môžeme kľudne skočiť obaja, pretože príslušník najinteligentnejšieho národa vyskočil s mojím batohom.              ', 510, 4.28, 27),
	(6058, 'Cigáň povedz pomaranč.\r\nTaké ľahké: činčaranč.              ', 69, 3.43, 27),
	(6059, 'Učiteľka slovenčiny v cigánskej osada vyvolá Dežka.\r\n"Deži, vyskloňuj my slovo žemla."\r\n"...Kto čo?, ...žemla,\r\nS kým s čím?, ...so šunkou,\r\nKomu čomu?, ...mne.              ', 190, 3.65, 27),
	(6060, 'Ide vlak tajgou, zrazu nastane obrovský výbuch a z vlaku ostane len hromada šrotu. Tí, ktorí to prežili sa vybrali pešo po trati. Po dvoch dňoch nájdu pri trati zemľanku a v nej dedka. Dedko sa ich pýta:\r\n- Odkiaľ idete, dobrí ľudia?\r\n- Z Moskvy.\r\n- A čo Lenin, ešte žije?\r\n- Lenin je večne živý, dedko.\r\n- A čo revolúcia, ako?\r\n- Revolúcia sa skončila pred sedemdesiatimi rokmi, dedko.\r\nDedko sa strašne rozčúli:\r\n- A to mi súdruhovia nevedeli oznámiť?! Veď ja mám aj inú robotu ako vyhadzovať vlaky do vzduchu!              ', 560, 4.05, 27),
	(6061, 'Príde Dežo do pôrodnice, pozerá sa okolo seba a zhíkne:\r\n- Dyk, kam som to prišiel? Všade samí skíni!              ', 124, 3.69, 27),
	(6062, 'Sedemdesiate roky. Socialistické Československo. Do električky nastúpi černoch, študent zo spriatelenej Afriky. Mara na\r\nneho chvíľu zíza, no potom sa neudrží:\r\n- Ľudia... pozrite... opica!\r\nOstatní cestujúci sa zborovo pustia do Mary, aby takto neurážala\r\nštudentov zo spriatelenej Afriky. Aby sa mu okamžite ospravedlnila...atď. \r\nMara teda nakoniec zo seba dostane:\r\n- Prepáčte!\r\n- Nič, sa nestalo. \r\n- odpovie nahnevane černoch.\r\n- Ľudia... \r\n- zhíkne Mara - tá opica hovorí!!!              ', 522, 4, 27),
	(6063, 'Prišiel turista do Škótska a hneď na prvej prechádzke stratil psíka. Zatelefonoval do redakcie miestnych novín, aby zverejnil inzerát, v ktorom sľúbil dve libry tomu, kto ho nájde. Po hodine príde do redakcie a pýta sa vrátnika, kde nájde redaktora, s ktorým pred chvíľou telefonoval.\r\n- Odišiel.\r\n- A kde je šéfredaktor?\r\n- Nikto tu nie je, všetci odišli hľadať nejakého psa.              ', 416, 4.1, 27),
	(6064, 'Sociálna kurátorka navštívi cigánsku osadu a pýta sa jedného:\r\n- Nemáte vši?\r\n- Nič nemáme, deti všetko pojedia.              ', 138, 3.68, 27),
	(6065, 'Viete prečo Cigáni nehrajú v Startreku?\r\nPretože sa s nimi do budúcnosti nepočíta.              ', 103, 4.08, 27),
	(6066, 'Rozprávajú sa dvaja arabskí šejkovia:\r\n”Nášmu Alimu sa zapáčili ženy športového typu. Zajtra sa žení s naším ženským basketbalovým tímom.”              ', 175, 3.67, 27),
	(6067, 'Koenigswald stojí nad hrobom svojho priateľa Steigermarka a číta náhrobný nápis. \r\n"Tu odpočíva Izák Steigermark, riadny človek, poctivý obchodník." \r\nKoenigswald si povzdychne: \r\n- Chudák Steigermark, musí ležať v hrobe s dvoma cudzími ľuďmi...              ', 279, 3.92, 27),
	(6068, '- Tak jako, strýco, jak je to s tú vašú kozú, co ste ju učil, aby nemusela žrat?\r\n- Ale, chuderka, už to skoro vedzela, kedz tu naráz zdechla!              ', 165, 4, 27),
	(6069, 'Záhorák píli motorovou pílou drevo. Zapíli raz, a dva prsty sú v ťahu. Zapíli druhý raz a ďalšie dva prsty sú v ťahu. Pozerá sa na tú ruku, ako tam ostal iba ten malíček, a tak smutne mu hovorí: \r\n- No, a ty co tu sám budeš.\n', 245, 3.95, 27),
	(6070, 'Pýtajú sa Záhoráka.\r\n- Vieš, ktorý slovenský región je najzaostalejší?\r\nZáhorák sa zamyslí a po chvíli hovorí:\r\n- Ale písničky máme pjekné.              ', 172, 3.8, 27),
	(6071, 'Ze záhorackého slovníka: Rýchlik - včiu byu tu a už je v rici, Windsurfing - uatečka s puachetku                  ', 121, 3.43, 27),
	(6072, 'Dzeci, kdo z vás ví, proč bociany na zimu odlecia do teplých krajú?\r\n- Prosím proto, lebo aj černosi chcú mjet dzeci.              ', 139, 4.15, 27),
	(6073, 'Víte proč si Záhoráci dávajú večer noviny do ledničky?\r\nNa aby byui rano čerstvé správy.               ', 114, 4, 27),
	(6074, 'Deži si kúpi novú škodovku a tak sa vozí po meste hore -dole, až chytí defekt. Vylezie von, otvorí kufor. Tu ide okolo iný Cigán:\r\n- Dyk, čo to robíš?\r\n- Ha, vyberám rezervu, neé?\r\nDruhý Cigán vezme kameň, rozbije sklo a povie:\r\n- Dyk, tak ja beriem rádio...              ', 291, 4.25, 27),
	(6075, 'Dodo bol dlhší čas chorý. Náco ho chodil statočne navštevovať, ba raz prišiel aj s Málikou.\r\n- Hneď sa cítim lepšie, ked vidím tvoju ženu, hovorí Dodo.\r\n- A to už prečo?\r\n- Že ja som sa vtedy s ňou neoženil.              ', 242, 4.08, 27),
	(6076, 'Stretli Važťana v Hrádku. Pýtali sa ho:\r\n- Kam ideš, Jano?\r\n- Ale, na súd.\r\n- A prečo?\r\n- Nuž, zaťau som do kožucha sekerou a v tom kožuchu bou otec..\n', 162, 4.25, 27),
	(6077, 'Sára je na smrteľnej posteli a prosí manžela: \r\n- Khon, sľúb mi, že až umriem, že pôjdeš za rakvou s mojou matkou. \r\n- Tak dobre, Sára, ja ti to sľubujem, ale upozorňujem ťa, že budem mať skazený celý deň.              ', 239, 3.75, 27),
	(6078, 'Stretnú sa dvaja Cigáni: \r\n"Dežo, kam ideš?" \r\n"Do Priora, idem si kúpiť sveter." \r\n"Ak ťa nechytia, kúp aj mne jeden!"\n', 128, 4.17, 27),
	(6079, 'Ako sa začína cigánska kuchárka?\r\n- Ukradneme tri vajcia.              ', 75, 3.95, 27),
	(6080, 'Príde Róm za gazdom: \r\n- Gazda, za sto korún budem u vás v záhrade robiť celý deň jak kôň! \r\n- No, keď sa ti chce, tu máš sto korún. \r\n-Miiiiihahahaha pfrrr, miiiiiih -hahahahaha pfrrrr...              ', 216, 4, 27),
	(6081, 'Hodina zemepisu v maďarskej škole: \r\n- Lászlo, pozri na glóbus a povedz mi, čo to je os?\r\n - Os..., to je taký veľký, páskovaný much!              ', 157, 4, 27),
	(6082, 'Cigáň prechádza cez hranice a vtom ho zastaví colník.\r\n- Kam ideš cigáň?\r\n- Teraz už akurát tak do riti.              ', 128, 4.21, 27),
	(6083, 'Traja Rómovia majú záujem stať sa policajtmi. Dostavili sa na stanicu, službukonajúci rotmajster im dal inštrukcie: \r\n"Budete chodiť po jednom k náčelníkovi do kancelárie a kto uhádne, čo je na ňom nezvyčajné, ten bude prijatý." \r\nPrvý vstúpil do kancelárie a povie: \r\n"Je mi to jasné, náčelník, vy nemáte uši." \r\n"Von!" vyhodil ho náčelník. \r\nVstúpil druhý a hneď vo dverách zvolal: \r\n"Náčelník, vy nemáte uši!" \r\n"Von!" zareval náčelník. \r\nVstúpil posledný Cigán, posadil sa pred náčelníka, desať minút ho pozoroval a vraví: \r\n"Náčelník, pozerám, že sa vám zlepšil zrak." \r\n"Výborne, Dežo, ako si na to prišiel?" \r\n"Jednoducho, náčelník. Už nenosíte okuliare..."              ', 744, 3, 27),
	(6084, '- Viete, kde vznikli Pokémoni? Na Morave predsa!\r\nBaví sa otec s matkou na dvore svojho statku v Kromeříži:\r\n- Mámo, hen ten náš mladé synek je blbé jak tá sfina. \r\nPo kém on je?              ', 204, 4, 27),
	(6085, 'Prídu dvaja do hotela a pýtajú sa na recepcii:\r\n- Máte voľnú izbu?\r\n- Áno, a máte rezerváciu?\r\n- A čo, vyzeráme ako Indiáni?              ', 150, 3.89, 27),
	(6086, '- Viete, akí sú traja najväčší hrdinovia rómskej kinematografie?\r\n- Dyk Trejsi, Mobi Dyk a Dykaprio.              ', 121, 3.87, 27),
	(6087, '- Babka, máte satelit?\r\n- A čo by som sa mala teliť, synak, čo som krava?              ', 91, 4.09, 27),
	(6088, 'Príde cigánka do stánku a pýta si:\r\n"Prosím si jednu Pravdu" Predavačka na to: \r\n"Prepáčte, ale Pravdu už nemáme, ale môžete si zobrať Život...." Cigánka: \r\n"Jáááááj ta ty si zober život ty krava jedna!"              ', 238, 4.07, 27),
	(6089, '- Dau si konem?\r\n- Dau.\r\n- A dost si im dau?\r\n- Aa, dost som im dau.\r\n- Šak si im ani toľko nemusel dat.\r\n- Šak som im ani toľko nedau.\r\n- A šak si im ani vôbec nemusel dat.\r\n- A šak som im ani nedau.              ', 221, 4.19, 27),
	(6090, '- Viete prečo majú Záhoráci tvrdé fašírky?\r\n- Lebo melú psa aj s búdou.              ', 94, 3.58, 27),
	(6091, 'Záhorák uloví z mora zlatú rybku.\r\n- Hej, ja som zlatá rybka a splním ti jedno želanie.\r\nZáhorák pouvažuje a povie:\r\n- Želám si, aby si nemala kosti.              ', 175, 4.08, 27),
	(6092, 'Vo vlaku stretne Rus Záhoráka a pýta sa ho:\r\n- Odkuda vy idiote?\r\n- Ja idiot z Mauacek!              ', 104, 4, 27),
	(6093, 'Dežo nakupuje v mäsiarni: \r\n"Prosim si kilo mäsa, ale veľo."              ', 78, 3.75, 27),
	(6094, 'Kúpim akékoľvek množstvo CD-Romov.\r\nZnačka: CD-Skin.              ', 71, 4.14, 27),
	(6095, 'Ide horár po lese a zrazu zbadá pytliaka - Cigána, ako nesie na pleci jeleňa. Zvolá naňho:\r\n-"Cigán, a čo to máš na pleci?" \r\n-"Šak nič."\r\n-"Ale na druhom."\r\n-"Dyk jeleň, a aký prítulný."              ', 217, 3.89, 27),
	(6096, 'Prečo sú peniaze zelené?\r\nPretože ich Židia zbierajú, ešte než sú zrelé.\n', 83, 3.63, 27),
	(6097, 'Čo je židovské dilema?\r\nŠunka zadarmo.\n', 43, 3.8, 27),
	(6098, 'Viete, kto bol inšpiráciou pre vznik triatlonu?\r\nCigáni.\r\nBežia na kúpalisko, tam si zaplávu a späť idú na bicylky.\n', 125, 3.64, 27),
	(6099, 'Ide cigáň na Mercedese a dostane defekt. Vytiahne hever a začne opravovať. Vidí to druhý cigáň, rozbije okno a vraví: \r\n"Okej, ber kolesá, ja si beriem rádio."\n', 171, 3.75, 27),
	(6100, '"Cigáň, kde robíš?"\r\n"Na letisku."\r\n"A čo tam robíš?"\r\n"Lietam."\r\n"A s čím?"\r\n"S fúrikom."\n', 101, 4.18, 27),
	(6101, 'Záhoraci hrajú šachy.\r\n- Mat! Povie prvý.\r\n- Otyc! Povie druhý.              ', 82, 3.35, 27),
	(6102, 'Aký je rozdiel medzi Japonskom a Slovenskom?\r\nJaponsko je krajina úsmevu a my sme krajina na smiech.\n', 103, 3.93, 27),
	(6103, 'Turista sa pýta:\r\n“Prosím vás, je toto druhá ulica vpravo?“\n', 68, 3.33, 27),
	(6104, 'Kňaz sobášil škótsky pár priamo v ich byte. Po obrade si ho vzal ženích bokom a pošepkal mu: “Viete, ja vám teraz nemôžem zaplatiť, ale poďte so mnou do pivnice a ja vám ukážem, čo musíte urobiť s plynomerom, aby vám nič nepočítal.”              ', 274, 3.81, 27),
	(6105, 'Rozprávajú sa Američan, Nemec a Arab. Američan:\r\n- Mám 4 synov, ešte si urobím jedného a mám basketbalové družstvo.\r\nNemec na to:\r\n- Mám 10 synov, ešte jeden a bude futbalové mužstvo.\r\nArab sa zasmeje a hovorí:\r\n- Mám 17 žien. Ešte si vezmem jednu a mám golfové ihrisko.\n', 292, 4, 27),
	(6106, 'Výpoveď rómskeho svedka:\r\nIde nič netušiaci Róm po ulici. Zrazu sa mu na nôž napichne dôchodca a drzo mu nanúti svoju peňaženku!              ', 154, 3.8, 27),
	(6107, 'Prezident Regan hostí generálneho tajomníka KSSZ Gorbačova s manželkou. Pri privítaní ukazuje ruskej dáme rozkošný kabriolet značky Ford a prosí ju:\r\n- Raisa Maximovna, vezmite si to  autíčko, ako  čisto symbolický darček odo mňa.\r\n- Taký dar nemôžem prijať! Som predsa manželka generálneho tajomníka. Čo by na to povedali prostí ľudia v Rusku.\r\n- Tak vám to auto predám, navrhuje Regan. Stojí presne jeden dolár.\r\n- Ach, vzdychne Raisa Maximovna, ale ja mám len päťdolárovku. Žiaľ, nemám vám vydať \r\n- rozpačite reaguje Regan.\r\n- Tak viete čo, dajte mi tých áut päť.              ', 628, 4.22, 27),
	(6108, 'Cigán, Vietnamec a skín chytajú ryby a chytia zlatú rybku. Rybka im hovorí: \r\n“Ak ma pustíte, splním každému jedno želanie.”\r\nCigán hovorí: “Ja by som si želal, aby vymreli všetci Vietnamci.”\r\nUmierajúci Vietnamec: “Ja chcem, aby vymreli všetci Cigáni.”\r\nSkín: “Tak ja už len kávu.”                ', 334, 4, 27),
	(6109, '- Cigán, vyskloňuj slovo “chleba”.\r\n- Kto, čo - chleba.\r\n- S kým, s čím - so šunkou.\r\n- Komu, čomu - mne.                ', 133, 3.73, 27),
	(6110, 'Príde Cigán na Úrad práce a hovorí: “Chcem prácu.”\r\nÚradníčka: “Nó, máme tu miesto riaditeľa banky.”\r\nCigán: “Robíte si srandu?”\r\nÚradníčka: “No, vy ste začal.”              ', 208, 4.11, 27),
	(6111, 'Chytí detvanec zlatú rybku a tá mu hovorí, že ak ju pustí, splní mu tri želania. Tak ju pustí a hovorí:\r\n- Chcem, aby bol Hron plný rumu.\r\nStalo sa. \r\n- Chcem, aby bol aj tento potôčik plný rumu.\r\nStalo sa. Detvanec dlho rozmýšľa a nakoniec hovorí:\r\n- Vieš čo, daj ešte pol deci a zmizni.              ', 323, 4.13, 27),
	(6112, 'Príde cigánka k lekárovi a sťažuje sa:\r\n- Pán doktor, ten môj starý by sa so mnou stále len miloval, doma už dvanásť deciek, poraďte, čo mám robiť?\r\n- Skúste mu dať prezervatív. - poradí lekár.\r\nNa druhý deň príde natešená cigánka opäť a vraví:\r\n- Aký ste skvelý pán doktor. Dala som to starému do večere. On sa vám tak nafúkol a na zadku sa mu urobil taká bublina, že štyri decká od smiechu skapali...              ', 457, 3.93, 27),
	(6113, 'Príde černoch k lekárovi a vraví:\r\n- Pán doktor, bolí ma hrdlo, mám teplotu a skrátka necítim sa dobre.\r\nLekár premýšľa a hovorí:\r\n- Vyzlečte sa do pol pása a kľaknite si do ľavého rohu ordinácie.\r\nPozerá, pozerá a o chvíľu vraví:\r\n- To nie je ono. Kľaknite si do pravého rohu.\r\nLekár zase pozerá a potom vraví:\r\n- Kľaknite si ešte doprostred miestnosti.\r\nČernoch už má toho dosť a pýta sa:\r\n- Pán doktor, viete už konečne, čo mi je?\r\n- Máte chrípku, to viem už dávno, - odpovedá lekár, - ale chcem si kúpiť ebenový stolík a neviem kam ho dať.              ', 609, 4.03, 27),
	(6114, 'Žena žida je židle?\r\nŽena černocha je černica?\n', 53, 2.94, 27),
	(6115, 'Prišiel raz Cigán na policajnú stanicu, že by sa chcel stať policajtom. Tak si ho zavolá k sebe náčelník, že mu položí niekoľko otázok. Opýtal sa ho, kto napísal Reportáž písanú na slučke. Cigán premýšľa a vtom zazvoní telefón a náčelník musí odísť. Dá Cigána na starosť svojim podriadeným, že má povedať, kto napísal Reportáž písanú na slučke. Po hodine sa náčelník vráti a vidí ležať Cigána v rohu, zbitého do krvi. Pýta sa podriadených, čo sa tam dialo.\r\n- Už sa priznal, - vraví jeden, - napísal to s bratom...              ', 589, 3.6, 27),
	(6116, 'Príde Cigánka do trafiky a vraví predavačke:\r\n- Dik, daj mi jedny sparty!\r\n- Ľahké alebo tvrdé? - pýta sa predavačka.\r\n- Dik, jaká si zvedavá!              ', 167, 3.86, 27),
	(6117, 'Pribehne indián k náčelníkovi Vinetuovi a kričí:\r\n- Vinetou, mám pre teba dve správy. Jednu dobrú a jednu zlú.\r\n- Tak najprv tú zlú. - hovorí Vinetou.\r\n- Na prériu sa prihrnuli Cigáni.\r\n- Uf! A tá dobrá správa?\r\n- Chutia ako bizóny.              ', 265, 4.17, 27),
	(6118, 'V Rusku sú dva obchody - rybí a mäsový. Príde chlapík do rybieho a pýta sa:\r\n"Prosím vás, nemáte mäso?"\r\nPredavač na to:\r\n"Nie, u nás nemáme ryby, mäso nemajú oproti."              ', 197, 3.67, 27),
	(6119, 'Japonec sa  motá okolo salaša, ide  bača a pýta sa ho:\r\n“Počúvaj, čo sa tu moceš, jak sa voláš ?“\r\n“Ja som Kim Tsu Tchan.“ hovorí Japonec.\r\n“Ty si debil a nie Kysučan! Ja Kysučanov veľmo dobre poznám!“\n', 229, 4.15, 27),
	(6120, 'Škót s manželkou si chcú zalietať na športovom lietadle, ale obom sa zdá cena príliš vysoká. Dlho skúšajú prehovoriť pilota, aby im dal zľavu. On odmieta až nakoniec vraví:\r\n"Tak dobre, poletíte zadarmo, ale bude to poriadna jazda a vy musíte byť celú dobu ticho. Akonáhle sa ozvete, zaplatíte celú sumu."\r\nManželia súhlasia a nasleduje šialený let, stúpanie, klesanie, vývrtky, výkruty, otočky - hotová letecká akrobacia - a manželia sú stále ticho. Po hodine pilot pristane a s obdivom sa k nim otočí:\r\n"Teda, ste naozaj dobrí, to snáď ešte nikto nevydržal. Každý pri takomto lete reve od strachu. A Škót odpovedá:\r\n"No, ale viete, už som skoro vykríkol, keď manželka vypadla z lietadla."              ', 757, 4.12, 27),
	(6121, 'Dežo si nesie cez les fúru dreva, ale z diaľky ho vidí polesný. Na druhý deň príde polesný za Dežom a hovorí:\r\n”Dežo, kde máš to drevo, čo si včera niesol cez les?”\r\n”Aké drevo? Ja nemám nijaké drevo.”\r\n”Ale ja som ťa včera videl, nože poďme na pôjd.” nedá sa polesný.\r\nNa pôjde veľká kopa už nasekaného dreva.\r\n”Dežo a toto je čo?”\r\n”Dyg more, čo tie lastovičky všetko nenanosia.”              ', 451, 4.15, 27),
	(6122, 'Príde Cigán za policajtom a hovorí mu:\r\n”Pán príslušník, okradli ma!”\r\n”A čo ti ukradli?”\r\n”Tridsať peňaženiek.”              ', 149, 4.12, 27),
	(6123, 'Mladá neskúsená Cigánka sa vydáva,\r\na tak sa pýta matky:\r\n”Mama, čo mám vlastne robiť počas svadobnej noci?”\r\n”Nič sa neboj, dcéra moja, Dežo ti dá to, čo má najradšej, tam, kde ty cikáš.”\r\nDcéra rozmýšľa a hovorí:\r\n”Ale mama, prečo by dával adidasky do drezu??!”               ', 316, 3.95, 27),
	(6124, 'Vo veľkej budove vypukne požiar a jedinou možnosťou ako uniknúť je skočiť do plachty. Požiarnici sa rozostúpia a čakajú. Vyskočí beloch - chytia ho. Vyskočí druhý beloch - chytia ho, ale keď vyskočí Cigán, tak sa uhnú. Vyskočí druhý - uhnú sa. Jeden požiarnik to nevydrží a zakričí hore:\r\n”Tých zhorených už nehádžte!”              ', 372, 4.08, 27),
	(6125, 'Aká je jednotka odporu k práci?\r\n- Jeden Róm', 47, 3.71, 27),
	(6126, 'Aranka píše do časopisu BRAVO: "Ahoj BRAVO, mám už 12 rokov a ešte nie som tehotná... Nie je môj otec homosexuál?"', 123, 3.78, 27),
	(6127, 'Učiteľka sa pýta Deža....\r\n-Dežko, povedz mi zviera na P.\r\nDežko na to: ...Potkan.\r\n-Dobre Dežko, a teraz zviera na D.\r\nDežko na to: ...Dva potkany.\r\n-Ale Dežko, skús zviera na Ž.Dežko sa zamyslí a povie: ..Žeby tri potkany???', 240, 3.58, 27),
	(6128, 'Na veľkej budove vypukne požiar a jedinou možnosťou ako uniknúť je skočiť do plachty. Požiarnici sa rozostúpia a čakajú. Vyskočí beloch - chytia ho. Vyskočí druhý beloch - chytia ho, ale keď vyskočí cigáň tak sa uhnú. Vyskočí druhý - uhnú sa. Jeden požiarnik to nevydrží a zakričí hore:\r\n- Tých zhorených už nehádžte!\r\n', 356, 4, 27),
	(6129, 'Irenka bola si už na Labuťom jazere?\r\nBola.\r\nNo,a?\r\nNo, bola som, ale Balaton je Balaton.', 91, 3.4, 27),
	(6130, 'Dežo robí autoškolu. Na križovatke prejde cez stopku a inštruktor mu vraví:\r\n"Vy ste nezbadal, aká tam bola značka?"\r\n"Zbadal, hliníková - mám sa vrátiť?"', 167, 4.19, 27),
	(6131, 'Viete prečo somárom nesvietia oči??\r\n?????\r\nLebo potom by Záhorie muselo svietiť ako Las Vegas.', 100, 3.69, 27),
	(6132, 'Stojí Američan, Francúz, Slovák a cigáň na Eiffelovke. Američan začne vyhadzovať doláre a hovorí: "My ich máme v Amerike dosť.". Francúz začne vylievať šampanské: "My ho máme vo Francúzsku dosť.\r\nA Cigáň pozrie na Slováka a hovorí: "Nie že spravíš nejakú kravinu."', 293, 4.15, 27),
	(6133, 'Stretnú sa dvaja maďarsky hovoriaci občania:\r\n- Mám celé prsty od mŕtvice.\r\n- To nič nie je, ja som mal včera živicu. ', 127, 3.18, 27),
	(6134, 'Na smrtneľnej posteli hovorí otec synovi:\r\n"Synak, keď je dnes to dvojité občianstvo, vybav mi maďarské občianstvo."\r\n"A prečo pre Boha práve teraz otec?"\r\n"Lebo keď zomriem, aspoň bude o jedného Maďara menej."', 224, 4.21, 27),
	(6135, 'Luki CupiLupi Králik\r\nMaďar vysvetľuje, čo je to včela:  Cella to taký malý iže, líta jak táčik, štípe jak sviňa, celofán krídla má, pruhovaný tričko nosíi, sere sladký vazelín a bútľavý strom garážuje.', 229, 4.11, 27),
	(6136, 'Východniar v lietadle:\rZnace co, Ja mám také neščesce, dze som, tam še takoj coškaj staňe...\rZ reproduktora sa ozve: - Lietadlo havaruje, keďže sme nad morom, každý pasažier dostane píštalku na odháňanie žralokov ...\rVýchodniar začne lamentovat: - Uvidzice, budz vyfasujem píščalku bez džúrky, abo natrafim na hluchoho žraloka.', 353, 3.98, 27),
	(6137, 'Viete čo je najhoršia kombinácia?\r\nNo, predsa cigáň z Maďarska žijúci na Východnom Slovensku.', 102, 3.71, 27),
	(6138, 'Róm číta na škatuľke od cigariet "Vážne škodí zdraviu" a hovorí si: No, ale na lopatu to nenapíšu.', 110, 3.89, 27),
	(6139, 'Príde rusnák do Prahy a potrebuje si zatelefonovať. Príde k telefónu, vytočí číslo, no na druhej strane sa ozve: "Hoďte minci, hoďte minci...." a rusnák na to: "Pani ja s Vami nebisiduju, ja choču Helenu!"', 218, 3.81, 27),
	(6140, 'Učiteľ sa pýta žiakov:\r\n"Deti, čo ste včera robili?"\r\nHlási sa Alenka: "Prosím, ja som sa hrala na piesku."\r\n"Výborne, Alenka. A keď napíšeš na tabuľu bez chyby PIESOK, dostaneš kúsok koláčika."\r\nAlenka sa sústredí, napíše PIESOK a za chvíľku si už pochutnáva na veľkom sladučkom kúsku koláčika. \r\nPotom sa hlási Mirko: "Prosím, ja som sa hral na piesku s Alenkou!"\r\n"No to je pekné, Mirko. Teraz napíš na tabuľu HRA, a keď to bude bez chyby, dostaneš tiež koláčik."\r\nMirko na druhý pokus napíše trasúcou sa rukou HRA a už cestou do lavice si odhrýza z koláčika.\r\n"A čo si robil ty, Dežko?" pýta sa pán učiteľ.\r\n"Prosím, chcel som sa hrať s Alenkou a Mirkom, ale oni po mne hádzali kamene!"\r\n"No to sa teda naozaj zachovali nepekne!" \r\nAle, keď napíšeš bez chyby:\r\nBEZPRECEDENTNE DO NEBA VOLAJÚCA RASOVÁ DISKRIMINÁCIA RÓMSKEJ MENŠINY, dostaneš koláčik aj Ty:"', 930, 4.19, 27),
	(6141, 'Sú dve veci, ktoré sú nekonečné - vesmír a ľudská hlúposť. Ale s vesmírom som si ešte nie celkom istý (Albert Einstein).', 133, 3.31, 28),
	(6142, 'Rozprávajú sa dvaja dedovia:\r\n- Aké je to milovať sa po osemdesiatke?\r\n- Ako keby si chcel hrať biliard a namiesto tága by si mal lano.', 141, 3.81, 28),
	(6143, 'Viete, prečo si žena pri bozkávaní zatvára oči?\r\nAby nevidela toho somára, ktorý začína od hora. ', 107, 3.18, 28),
	(6144, 'Nikdy neverte jasu v očiach krásnej ženy. Je to iba slnko, ktoré presvitá cez jej dutú hlavu.', 99, 3.37, 28),
	(6145, 'Priateľstvo nie je zločin, tak sa netvár akoby si stál pred popravčou čatou.', 82, 3.02, 28),
	(6146, 'Viete, ako spoznáte, že je zima?\r\nMuchy začnú lietať v teplákoch.', 71, 3.08, 28),
	(6147, '- Ja už nikomu neverím! Ja už nikomu neverím! - vykrikuje dedko na ulici. Chcel som si prdnúť a posral som sa!', 116, 3.28, 28),
	(6148, '- Dedo, kde ste boli včera?\r\n- To by si rád vedel, synáčik?! Aj ja!', 71, 3.16, 28),
	(6149, 'Viete, že:\r\n- niektoré výrobky nášho obuvníckeho priemyslu nemajú páru?\r\n- aj ľudom s titulom možno veľa vecí vysvetliť po lopate?\r\n- je ľahšie nájsť ihlu v kope sena, ako v rukách dnešných dievčat?\r\n- pohnúť rozumom môže iba neurochirurg?\r\n- ak niekto verí v šibnutie čarovným prútikom, je šibnutý?\r\n- darovanému koňovi sa na zlaté zuby nepozerá?', 383, 3.15, 28),
	(6150, 'Dedko príde na verejné WC, rozopne si zips na nohaviciach, dá ruky za chrbát, a začne močiť. Moč mu strieka na všetky strany, a chlapík vedľa neho odskočí, a hovorí mu:\r\n"To si ho neviete chytiť normálne do ruky ?"\r\n"Kto ma raz zradil, tomu ruku nepodám."', 272, 3.57, 28),
	(6151, 'Kto sa smeje naposledy, ten leží na smrteľnej posteli...', 59, 3.37, 28),
	(6152, 'Kto se smeje naposledy, tomu váš vtip zrejme nedošiel.', 57, 3.27, 28),
	(6153, 'Živí sú mŕtvi na dovolenke.', 31, 3.03, 28),
	(6154, 'Uzavrieme to tak, že to necháme otvorené.', 44, 3.26, 28),
	(6155, 'Sedí dedko s babkou vo svojom malom domčeku. Dedko sa zrazu postaví a hovorí:\r\n- Idem domov!', 96, 2.9, 28),
	(6156, 'Vnučka sa pýta dedka:\r\n- Dedko, ako zistím, že som opitá?\r\nDedko pozrie cez okno a vraví:\r\n- Keď uvidíš tamtie dve, ako štyri.\r\n- Dedko?\r\n- Čo?\r\n- Tam je len jedna!', 175, 3, 28),
	(6157, 'Koľko krát v živote sa hanbí muž?\r\nDvakrát. Prvýkrát, keď nemôže druhýkrát. Druhýkrát, keď nemôže ani prvýkrát!', 131, 3.23, 28),
	(6158, 'Viete, že muži mali voľakedy 3 vajcia?\r\nZ jedného sa im totiž vyliahol vták.', 82, 3.27, 28),
	(6159, 'Rozprávajú sa dvaja vyrastkovia:\r\n- Dedko mal pravdu, keď mi povedal, že nemám chodiť do erotického klubu, lebo sú tam veci, ktoré by som nemal vidieť.\r\n- A čo si tam videl?\r\n- Dedka.', 194, 3.31, 28),
	(6160, 'Vraví dedko Hanke.\r\n- Pomáhal som partizánom.\r\n- A čo vám za to dali?\r\n- Povedali "Danke".', 95, 3.38, 28),
	(6161, 'Do autobusu nastúpi punker s veľkým zeleným három. Sadne si na voľné miesto a všimne si, že ho pozoruje starý dedko. Po desiatich minútach to punker nevydrží a opýta sa dedka:\r\n"No, dedo Vy ste v mladosti nerobili žiadne hlúposti?"\r\n"Ale áno, pretiahol som papagája a teraz pozerám či nie si môj syn."', 322, 3.54, 28),
	(6162, 'Lepší kondóm v dierke ako dierka v kondóme.', 47, 3.47, 28),
	(6163, 'V pive je vitamínov málo, preto ho musíme piť veľa.', 56, 3.7, 28),
	(6164, 'Jedzte veľa zeleniny,\r\npite veľa vínka,\r\nsplašia sa vám vitamíny,\r\nbudete mať synka.', 91, 3.19, 28),
	(6165, 'Žena je ako mapa sveta.\r\n- od 16 - 20 rokov ako Afrika, z časti panenská, z časti preskúmaná\r\n- od 21 - 35 rokov ako Ázia, horúca, záhadná, nik nevie čo sa v nej do budúcnosti skrýva\r\n- od 36 - 45 rokov ako Amerika, namyslená na svoju techniku\r\n- od 46 - 55 rokov ako Európa, zdevastovaná, ale na niektorých miestach zaujímavá\r\n- viac ako 60 rokov ako Austrália, každý o nej vie, ale nik sa ju nechystá navštíviť', 438, 3.29, 28),
	(6166, 'Na obed sa zoznámili, večer sa zosobášili a ráno ju uškrtil! Aké ponaučenie z toho plynie? Ráno múdrejšie večera.    ', 129, 3.23, 28),
	(6167, 'Zajac sa prechádza po lese a padne do jamy. Začne kričať o pomoc. \r\nPríde vlk, vytiahne mužský penis a zajac sa vyšplhá. O mesiac na to, padne vlk do jamy a volá o pomoc, na to príde zajac, porozmýšľa, vytiahne mobil a zavolá požiarnikov. Čo z toho vyplýva?\r\nKaždý kto nosí mobil má krátkeho vtáka.', 322, 3.11, 28),
	(6168, 'Slovenské porekadlo:\r\nV závode na spracovanie obilia riadenom nadprirodzenou bytosťou je nízka produktivita práce vyvážená úplnou spoľahlivosťou.\r\n(Božie mlyny melú pomaly ale isto.)', 195, 3.66, 28),
	(6169, 'Nikdy nefackaj hluchého. Prichádza o polovicu pôžitku, lebo tvoju facku iba cíti, ale nepočuje.', 101, 3.26, 28),
	(6170, 'Keby si býval tak ďaleko aký si hlúpy, nikdy nedôjdeš domov!', 66, 3.48, 28),
	(6171, 'Aka je pravá podstata hemendexu?\r\nJe to hodinová práca pre sliepku a celoživotné rozhodnutie pre prasa.', 108, 3.11, 28),
	(6172, 'Kto sa smeje naposledy, strieľal ako prvý.', 44, 3.78, 28),
	(6173, 'Clapci zo susednej dediny prišli k dedovi Makarovi:\r\n"Dedo, čím to je, že vám už ťahá na 90-tku a všetky dievčatá z okolia sa bláznia len za vami?"\r\n"Neviem chlapci, neviem..."\r\nHovorí dedo a oblizne si pri tom šedivé obočie.', 241, 3.35, 28),
	(6174, '"Otec mi vždy hovoril, že s medveďmi treba opatrne."\r\n"V akom zmysle? Na poľovačke?"\r\n"Nie, on bol zoofil."', 112, 3.58, 28),
	(6175, 'Dve najväčšie radosti Slováka:\r\n1. keď niečo ukradne\r\n2. keď príde na to, na čo mu to môže byť', 106, 3.27, 28),
	(6176, 'Pri vykopávkach v starovekom Ríme objavili v zemi nejaké drôty. Pravdepodobne už starí Rimania používali telefón. Pri vykopávkach v starej Rusi nenašli žiadne drôty. Pravdepodobne starí Rusi komunikovali pomocou mobilov.', 234, 3.21, 28),
	(6177, 'Podľa posledných výskumov obsahuje pivo veľké množstvo ženských hormónov. Tým sa vyjasnilo, prečo:\r\n- po treťom pive začínate horšie šoférovať\r\n- po šiestom sa chichúňate každej somarine\r\n- po dvanástom začínate čurať posediačky.', 257, 3.41, 28),
	(6178, 'Pýta sa vnúčik dedka: \r\n- Dedko, prečo zakrývaš studňu na na noc plachtou?\r\n- Aby sa nevyliala voda, keď sa bude krútiť Zem!', 134, 3.11, 28),
	(6179, 'Múdre čínske príslovie: Ak máš dáždnik v zadku, za žiadnu cenu ho neotváraj.', 86, 3.42, 28),
	(6180, 'Vnúčik sa pýta dedka:\r\n- Dedo a prečo ty všetko hovoríš dvakrát?\r\n- Ani neviem, Miško môj, ani neviem.', 112, 2.88, 28),
	(6181, 'Ženy sú ako hracie automaty. Nedajú hocikde, vždy a každému.', 66, 3.1, 28),
	(6182, '- Dedko, už ste si kúpili ten strojček do uší?\r\n- Áno.\r\n- A koľko stál?\r\n- Trištvrte na sedem.', 103, 3.09, 28),
	(6183, 'Recept proti infarktu:\r\nPošli do riti každého skôr, ako ťa stihne nasrať.', 79, 3.4, 28),
	(6184, 'Jeden iniciativny blbec je horší ako koordinovana skupina záškodníkov!', 75, 3.43, 28),
	(6185, 'Lož má krátke nohy.\r\nAle to nevadí, lebo dnes sú už skoro všade bezbariérové vstupy.', 93, 3.21, 28),
	(6186, 'Dedko príde k lekárovi a sťažuje sa:\r\n- Pán doktor, tie prášky, čo ste mi dali vôbec nezaberajú.\r\n- A aké ste užívali?\r\n- Tie najlepšie z reklamy - Persil a Palmex!', 178, 3.06, 28),
	(6187, 'Koľko krokov urobí vrabec za 100 rokov.\r\nNula, lebo vrabec skáče.', 69, 2.63, 28),
	(6188, 'Predchádzaj nemociam - umri.', 29, 3.17, 28),
	(6189, 'Starý dedko - námorník - sedí v miestnej krčme pri mori a rozpráva mladému plavčíkovi:\r\n- Pozri sa tam na more. To všetko a ešte viac som ja sám prebrázdil a prebádal. Celé roky námahy a odvahy som do toho dal. A dnes? Volajú ma Dežo Moreplavec? Nie, každému to je jedno. A pozri sa na ten barový pult. Ten som ja postavil, s ničím iným ako vlastnými rukami. Celé dva roky som strávil jeho vyhladzovaním, aby bol čo najrovnejší a najpohodlnejší. A dnes? Volajú ma Dežo Staviteľ Barov? Nie, každý na to zabudol.\r\nDedo si odpije z piva a mrmle si:\r\n- Ale raz sa človek ožere a pretiahne jednu kozu...', 638, 3.1, 28),
	(6190, 'Kto neskoro chodí - ďaleko býva!', 35, 3.45, 28),
	(6191, 'Stretnú sa dvaja muži a jeden hovorí druhému:\r\n- Neuveríš, čo sa mi stalo. Poslal som ženu pre zemiaky a zrazilo ju auto.\r\n- Preboha a čo budeš teraz robiť?\r\n- Neviem, asi ryžu.', 189, 3.29, 29),
	(6192, 'Prečo nosia muži kravatu?\r\nLebo každý vôl musí byť priviazaný.', 70, 3.68, 29),
	(6193, 'Čo robí mužov krásnymi? \r\nTma.', 34, 3.36, 29),
	(6194, '- Dežo, za koľko kúpiš moju ženu?\r\n- Za nič!\r\n- Je tvoja! ', 64, 3.19, 29),
	(6195, 'Aristid s Tasilom vo veľkej rýchlosti nabúrali do stromu. Aristidovi sa horko-ťažko podarí vyliezť z vraku a hľadá Tasila. Vtom sa ozve zo stromu:\r\n- Pán hlavný,platím.\r\nAristid sa pozrie na strom a tam je cez pás na haluzi prevesený Tasilo.\r\n- Tasilo,neblázni!My sme nabúrali,zlez dolu!\r\n- Pán hlavný, platím!\r\nNedalo sa nič robiť, Aristid našiel nejakú handru, prehodil si ju cez ruku a spýtal sa:\r\n- Tak čo sme to mali?\r\n- Mal som dve vajcia.', 470, 3.14, 29),
	(6196, 'Chlapi v krčme si rozprávajú príhody so sveta a s ciest. Jedna vtipná prihoda strieda druhú až príde rad na chlapa, ktorý strávil dva roky v Afrike. Ten vytiahne z vrecka 20 cm veľkého živého chlapa a vraví:\r\n- No Joži a teraz tuná chlapom povedz, ako si toho šamana v džungli do riti poslal.', 311, 3.18, 29),
	(6197, 'Muž verzus auto:\r\n0 - 20 rokov: muž je ako FIAT - malý a šikovný,\r\n20 - 30 rokov: muž je ako PORSCHE - rýchly a energický,\r\n30 - 40 rokov: muž je ako MERCEDES - perfektný,\r\n40 - 50 rokov: muž je ako ŠKODA - sľubuje viac, než môže urobiť,\r\n50 - 60 rokov: muž je ako TRABANT - treba ho ručne naštartovať,\r\nviac ako 60 rokov: treba vymeniť značku.', 367, 3.29, 29),
	(6198, 'Dedko sa rozhodol, že sa na staré kolená naučí machrovať. Vybral sa teda do mesta a zapísal sa na karate. Na prvej hodine sa ho inštruktor pýta, prečo sa vlastne rozhodol pre tento šport. Dedko na to, že on sa chce naučiť machrovať. Inštruktor mu podá sekeru a kaže mu, nech mu odsekne hlavu. Starý sa najprv zdráha, ale potom švihne, inštruktor sa uhne a hovorí:\r\n-No vidíte dedko, toto je machrovanie.\r\nDedko príde celý šťastný domov a hovorí žene:\r\n- Stará, kde je syn?\r\n- V lese rúbe drevo.\r\nStarý sa vyberie do lesa a hovorí synovi:\r\n- Synu, bol som v meste a naučil som sa machrovať.\r\n- Héééj, a ako sa to robí?\r\n- Zober sekeru a odsekni mi hlavu.\r\n- Čo ste sa zbláznili?!\r\n- Neodvrávaj, ber sekeru a odsekni mi hlavu!\r\nSyn zobere sekeru, švihne a šup, odsekne starému hlavu. Potom si zbalí veci a ide domov. Doma sa ho mama pýta:\r\n- Synu, kde máš otca.\r\n- Aaaale, machruje v lese.', 938, 3.28, 29),
	(6199, 'Ako z 10-tich chlapov vyberieš toho najsprostejšieho?\r\nNáhodným výberom.', 77, 3.15, 29),
	(6200, 'Jozef Janič sa vráti z afriky a prvé čo urobí je že navštívy kamarátov v krčme. Tí, keď ho uvidia, hneď sa pýtajú ako bolo. On na to:\r\n"Dobre a bol som aj na safari."\r\nOni: "A zastrelil si niečo?" \r\nOn: "Hej, štyroch krokodílov, piatich nosorožcov a zo štyridsať plísnoucoch." \r\n"Plísnoucoch, a to čo?"\r\n"No ta to asi také veľké ako ja, také čierne a ked to beží do džungle tak to kričí \'Please no,please no\'."', 444, 3.46, 29),
	(6201, 'Novák si len tak kráča stredom Sahary, keď tu zrazu "tfftfft, tfftfft" vrtuľník nad ním a z amplióna sa ozve hlas:\r\n"Človeče, čo tu robíte?"\r\n"Idem k moru..." \r\n"Zošaleli ste? More je odtiaľto 800 kilometrov vzdialené..."\r\n"Páni tomu ja hovorím pláž!"', 270, 3.65, 29),
	(6202, 'Novák je zamestnancom sťahovacej služby. Viac silný ako múdry, ale to nevadí. Šéf mu povie, že majú zaujímavú zákazku, istá pani potrebuje presťahovať klavír, ale nech sa správa slušne a distingvovane, lebo jej manžel je dôležité "zviera". Novák sa vráti zúrivý a s veľkým monoklom pod okom. \r\n- Čo si preboha zas pokazil? - pýta sa ho šéf\r\n- Nič také - bráni sa on - slušne som zazvonil, ona otvorila, ja že ruky bozkávam, prišiel som vám presťahovať klavír. No a tu ona urobila chybu, lebo začalo hovoriť veľmi múdro. Vraj nech jej ukážem svoj biceps. No a potom som sa zrejme zmýlil ja...', 642, 3.2, 29),
	(6203, '- Jožko, čo robíš tak dlho v tej kúpeľni?\r\n- Umývam si nohy.\r\n- Počuj, to je už tretí krát za temto polrok! Nemáš ty nejakú frajerku?', 147, 2.67, 29),
	(6204, 'Ako spoznáš, že sa muž chystá povedať niečo chytrého? Keď začína rozprávanie vetou "Raz mi niekto povedal..."', 121, 3.42, 29),
	(6205, 'Stretnú sa dvaja starí páni.\r\n- Ako sa máte? - pýta sa prvý.\r\n- Nie je to so mnou dobre, cikám stále vyššie - ťažká si druhý.\r\n- Čo sa vám na tom nepáči? Ste na tom ako mladík!\r\n- Kdeže mladík! Pred mesiacom som si ešte cikal na špice topánok, teraz už na kolená.', 289, 3.32, 29),
	(6206, 'V reštaurácii sa hosť pýta:\r\n-Pán hlavný, z čoho je to mäso, z kozy alebo z capa?\r\nČašník siahne do taniera, dá si kúsok do úst a vraví:\r\n-Toto mäso je z capa.\r\n-A ako ste to spoznali?\r\n-No viete, keby som si dal do úst kozu, tak by sa mi postavil.', 265, 3.38, 29),
	(6207, 'Manželia sedia v divadle a manžel si musí odskočiť. Blúdi po chodbách a nevie nájsť WC. Nakoniec na konci chodby zbadá miestnosť v pološere a v kúte jednu vázu. Tak si svoju potrebu vykoná do vázy a vráti sa späť. Opýta sa manželky:\r\n- Bolo niečo zaujímavé?\r\n- Ani nie. Iba ty si prišiel na javisko a vyčúral sa do vázy!', 348, 3.64, 29),
	(6208, 'Divoký západ. Vo vlaku sedí kovboj, fajčí cigaru a vyfukuje krúžky dymu. Po 15 minútach príde za ním indián:\r\n- Ešte slovo a dám ti po papuli!', 155, 4, 29),
	(6209, 'Príde chlapík do drogérie a žiada si čierny prezervatív.\r\n- Prečo práve čierny? - nechápe predavačka.\r\n- Aale, zomrel môj najlepší priateľ a chcel by som prejaviť sústrasť jeho manželke.', 205, 3.35, 29),
	(6210, 'Kedy je pripravený chlap na sex?\r\nKeď dýcha.', 47, 3.8, 29),
	(6211, 'Chlapec po prvý krát navarí frajerke obed. Počas hlavného vchodu sa frajerka spýta: \r\n- To mäso je z konzervy, zlatko?\r\n- Áno, miláčik. Bol tam nápis "pre vášho miláčika" a vedľa toho  taky chutný psík.', 220, 3.76, 29),
	(6212, 'Rozprávajú sa, Francúz, Angličan a Slovák. Angličan hovorí:\r\n- My v pondelok začneme stavať hotel, a v piatok sa v non už býva.\r\nFrancúz nato:\r\n- Monsieur, to nič nie je. My v utorok začneme stavať obchodný dom a v stredu sa už v ňom nakupuje.\r\nA Slováčisko hovorí:\r\n- Ale chlapi, však to furt nič nie je. My začneme v pondelok ráno stavať pivovar, a o desiatej sú už všetci opitý.', 411, 3.7, 29),
	(6213, 'Právnik zaparkuje jeho úplne nové auto Lexus priamo pred svojou kanceláriou. V tom ako vystupuje, blížiaci sa kamión odtrhne celé dvere auta na vodičovej strane.\r\nPrávnik sa začne hystericky rozčulovať:\r\n"Môj nový Lexus je úplne zničený, už nikdy nebude ako predtým aj keby klampiari urobili zázrak."\r\nVodič kamióna sa len znechutene pozerá a hovorí:\r\n"Vy právnici, vy ste taký materialistický, že si nevšímate nič iné. A to že vám chýba polovica ľavej ruky, ste nezaevidovali, to vás netrípi?"\r\nPrávnik:\r\n"Preboha, kde mám Rolexky?"', 574, 3.53, 29),
	(6214, 'Žena s milencom sú v tom najlepšom, keď zrazu počuť v zámku kľúče. Žena hovorí: \r\n- Manžel sa mi vrátil, rýchlo do skrine.\r\nI skryje sa milenec do skrine. Muž príde do spálne a znenazdajky skriňu otvorí a hovorí: \r\n- Vy ste kto?\r\n- Ja som deratizátor. Vaša manželka ma zavolala, lebo máte v skrini mole.\r\n- Ale prečo ste nahý? - pýta sa muž.\r\n- Hm, svine jedne nenažrané, ale sú rýchle!', 419, 3.32, 29),
	(6215, 'Dežo hovorí Gejzovi :\r\n- Moja žena smrdí potom.\r\n- Z toho si nič nerob - odpovie mu Gejza - moja smrdí aj predtým.', 121, 3.25, 29),
	(6216, 'Nemý muž príde do lekárne a chce si kúpiť kondómy. Na pulte však žiadne nie sú, takže nemôže ukázať, čo chce a musí sa s lekárnikom dorozumievať posunkami. To však už nejakú dobu trvá a lekárnik stále nevie, čo nemý pán chce. Ten si nakoniec zúfalý rozopne nohavice, vytiahne penis na pult a vedľa neho položí päťdolárovú bankovku. Lekárnik však urobí presne to isté, nohavice - penis - bankovka. Potom zoberie obe bankovky a strčí si ich do vrecka. Rozhorčený zákazník začne na lekárnika hrozivo gestikulovať. Ten ale hovorí:\r\n- Pozrite sa, keď neviete prehrávať, tak sa nabudúce nesnažte stávkovať.', 658, 3.57, 29),
	(6217, 'Novák, známy to ironik, hovorí žene:\r\n- Videl som, ako ti krajčírka brala miery na nový oblek.\r\n- A čo je na tom zlé? - pýta sa žena\r\n- No, ja len toľko, že dub potrebuje okolo 200 rokov kym dosiahne tvoju hrúbku...', 229, 3.09, 29),
	(6218, 'Škótovi odfúkne jeho starý, vyšedivený, deravý klobúk. Príde do klobučníctva a vraví: \r\n- No, a tak som tu zas...', 125, 3, 29),
	(6219, 'Novák vojde do obchodu so zmiešaným tovarom a hovorí:\r\n"Je sezóna plesov a ja chcem ísť na karneval preoblečený za Adama."\r\nPredavacka mu prinesie figový list.\r\n"Malý!"\r\nPredavačka prinesie ďalsi, väčší list.\r\n"Aj ten je malý!"\r\nPredavačka robí maximum pre spokojnosť klienta a prinesie ten najväčší list zo skladu.\r\n"Stále maly!"\r\nTo už ženu za pultom namôjdušu naserie:\r\n"Počuj šampión! Najlepšie bude ak si ho prehodíš cez plece a pôjdes prezlečený za benzínové čerpadlo!"', 517, 3.57, 29),
	(6220, '- Čo sa týka žien, my chlapi sme niekedy veľké svine!\r\n- Tak počuj, neštvi ma, hovor radšej v jednotnom čísle, áno?\r\n- Čo sa týka žien, ty si niekedy veľká sviňa...', 181, 3.13, 29),
	(6221, 'Muži a chlapci sa s ním radi hrajú a dosť im záleží aj na jeho veľkosti. Čo je to?\r\nTelefón.', 102, 2.88, 29),
	(6222, 'Starší pán vojde do holičstva. Brada až po kolená, vlasy po zadok. Sadne si do kresla, holič ho začne najskôr strihať a po hodnej chvíli hovorí. \r\n- Keď ste mali zhruba desať rokov, nosili ste baretku? \r\n- Áno, ale odkiaľ to viete?\r\n- No, práve som ju našiel.', 277, 3.11, 29),
	(6223, '- Tak čo pán Novák, aká bola dovolenka pri mori?\r\n- Horor! Celé dva týždne v kuse pršalo.\r\n- Ako to? Veď vidím že si opálený.\r\n- To nie je bronz, ale hrdza!', 169, 3.19, 29),
	(6224, 'Novák predáva noviny, keď tu sa pri ňom pristaví známy:\r\n- Počuj, požičaj mi do zajtra 1000 korún.\r\n- Nemôžem, mám takú dohodu tuto s bankou oproti.\r\n- Akú dohodu môže mať taký chudák ako ty s bankou?\r\n- Dohodli sme sa, že oni nebudú predávať noviny a ja nebudem poskytovať pôžičky.', 310, 3.01, 29),
	(6225, 'Dvaja železničiari:\r\n- Počul si? Novák dostal hodinovú výpoveď. A to len preto, že neoznámene vošiel do šéfovej kancelárie...\r\n- Iba preto?\r\n- No, je pravda, že on tam vošiel s lokomotívou...', 207, 3.2, 29),
	(6226, '- Novák, to si ty? Do pekla, ty si sa ale zmenil! Brada, brucho... Nevidel som ťa už vyše 140 rokov!\r\n- Ja sa ale nevolám Novák!\r\n- Tak ty si si aj meno zmenil?', 166, 3.2, 29),
	(6227, '"Novák, to je už piatykrát, čo tento týždeň meškáš! Vieš čo to znamená?"\r\n"Žeby už bol piatok?"', 110, 3.57, 29),
	(6228, 'Na záchode v nemocnici sa stretnú dvaja so silnou zápchou. Kabínky majú vedľa seba. Skúšajú to dostať von. Stony, výkriky bolesti, ochkanie, fučanie, plač a asi tak po štvrťhodine počuť:\r\n"Žblunk!!!"\r\n"Ty šťa..aaa...stli...iii..veec! - hovorí jeden.\r\n"Bllllbooosť," zastoná ten odvedľa "žiadne šťastie, to mi len hodinky spadli do misy."', 364, 3.05, 29),
	(6229, 'Medzinárodná súťaž národných tajných služieb. Do finále sa prepracujú tri tímy. Komisia im zverí najťažšiu úlohu. Pustí do džungle opicu a tajní agenti ju musia nájsť a priniest späť. Vyhráva tím, ktorý to dokáže skôr. CIA so svojou sofistikovanou technikou a pomocou satelitu to dokáže za 50 minút. Ruská KGB zapojí  parapsychológov a už o 30 minút opicu majú. Najviac však šokuje rumunský tím Securitate, ktory už po 15 minútach vyjde z lesa a ťahá so sebou slona. \r\n"Ale páni" - hovorí zdesená komisia - "to je predsa slon!"\r\n"To si len vy myslíte. Pri výsluchu priznal, že je tou hľadanou opicou!"', 655, 3.24, 29),
	(6230, 'Stredovek. Po mori sa plaví loď a na obzore piráti. Námornici podliehaju panike, ale kapitán je cool a hovorí svojmu sekundantovi, aby mu priniesol jeho červenú košeľu. Ten ju prinesie, kapitán ju natiahne na seba a zavelí do boja. Piráti sú na hlavu porazení. Tá istá vec sa stane aj na druhý deň, ked loď napadnú dve lode pirátov. Kapitan si dá červenú košelu a vyhrajú. Potom sa ho námorníci pýtaju, prečo si pred každým bojom oblieka červenú košeľu.\r\n"Keby som bol zranený počas boja, na červenej košeli by to nebolo vidieť a vy by ste aj naďalej bojovali ako levy..."\r\nNámornici sú dojatí toľkou statočnosťou a kričia kapitánovi na slávu. Na druhý deň však na obzore celá flotila pirátskych lodí. Námornici teraz už celkom cool čakajú na kapitánov rozkaz. Ten poruči sekundantovi:\r\n"Prines mi prosím ťa nejaké hnedé nohavice..."', 901, 3.67, 29),
	(6231, 'Tučný chlap stojí na váhe a sťahuje si brucho. Žena mu hovorí:\r\n- Myslíš, že ti to pomôže?\r\n- Samozrejme, že áno. Veď by som nevidel čísla!', 156, 3.13, 29),
	(6232, 'Turista prechádza dedinou a vidí ako na terase pred domom dedinčan hrá šachy so svojim psom.\r\n"No toto, snáď mi nechce povedať, že váš pes vie hrať šach?"\r\n"Čerta starého vie... Dnes už prehral štvrtú partičku..."', 232, 3.17, 29),
	(6233, 'Sedliak chytá ryby v rybníku a chytí zlatú rybku.\r\nZlatá rybka hovorí:\r\n"Splním ti jedno želanie."\r\nSedliak na to:\r\n"Ja nič nepotrebujem."\r\n"Ale ja ti chcem splniť jedno želanie."\r\n"Tak dobre. Chcem aby sa nebojovalo v Kosove."\r\n"Ale ja neviem kde to je."\r\n"Tak dobre, niečo iné. Vieš, moja žena je trochu škaredá keby si mohla ju\r\nnejako skrášliť."\r\nA rybka na to:\r\n"Radšej dones glóbus nájdeme Kosovo."', 427, 3.33, 29),
	(6234, 'Drevorubač príde o ruku. Lekári mu hovoria, že je tu šanca nasadiť mu umelú ruku ovládanú hlasom. Bude rovnako dobrá a možno aj silnejšia. Drevorubač ruku príjme.\r\nNasledujúci deň ide na záchod...\r\n"Rozopnúť."   \r\nzzzzzzz\r\n"Podržať."\r\n"Pretrepať."\r\n"AU! nechceš mi ho ešte urvať?"\r\nTrh!\r\n"Do prdele!" \r\nŠup!\r\n"Do hajzlu!!!" \r\nŠvih!', 358, 3.5, 29),
	(6235, 'Mal som brata. Bol kuchárom. Bol taký dobrý, že sa dostal do ponorky. Prihorela mu cibuľka, chcel vyvetrať. Už nemám brata.', 131, 3.7, 29),
	(6236, '- Miláčik, čo môžem pre teba ešte urobiť?\r\n- Vypni prsia, televízor a svetlo...', 87, 3.38, 29),
	(6237, 'Stretnú sa dvaja priatelia.\r\n- Ahoj, odkiaľ ideš?\r\n- Bol som u doktora, mám filcky.\r\n- No teda! Ja ich mám už 30 rokov, ale ešte choré neboli.', 150, 3.15, 29),
	(6238, 'Prídu Fero s Mišom na vyšetrenie k závodnému lekárovi. Keď ich sestrička uvidí nahých, počudovane sa pýta: \r\n- Ako je to možné? Obaja ste černosi a jeden máte čierneho vtáka a druhý bledého? \r\n- Akýže černosi? - vysvetľuje Fero - My sme baníci a Mišo si iba odskočil na obed domov.', 308, 3.64, 29),
	(6239, 'Nováka služobne premiestnili do nového mesta a hneď musel k závodnému lekárovi na prehliadku. Všetko v poriadku, len jeho mužská okrasa je viac ako miniatúrna.\r\n"Ako môžete žiť s takým malým?" - pýta sa doktor\r\n"Je to v poriadku. Mám peknú ženu, tri deti a bohatý sexuálny život. Akurát, že cez deň keď sa chcem ísť vyčúrať mám problémy s jeho hľadaním v nohaviciach..."\r\n"A v noci? V noci problémy s hľadaním nie sú?"\r\n"Nie, lebo v noci ho hľadáme dvaja."', 499, 3.3, 29),
	(6240, 'Príde Leoš o 15 minút neskôr na tenisový tréning a kolega sa ho vypytuje, kde toľko trčal. Hovorí:\r\n"Dnes som to nechal na mincu, ak padne hlava idem, ak nie, tak sa budem venovať manželke. No a tak som si musel až 18 krát hodiť."', 244, 3.37, 29),
	(6241, 'Rumun je na návšteve USA. Chodia po obchodoch, až Rumun nevydrží a zdôverí sa:\r\n"U nás máme oveľa lacnejšie práčky ako tu. Až na to, že sem-tam ich musíme aj pomilovať..."', 188, 3.25, 29),
	(6242, 'Rozprávajú sa mäsiar, výčapník a gynekológ. Mäsiar hovorí:\r\n"Sem svinka tam svinka a v garáži SIMCA."\r\nHovorí výčapník:\r\n"Sem borovička, tam borovička a v garáži EMBÉČKA."\r\nA gynekológ hovorí:\r\n"A ja mam MOSKVIČA"', 237, 3.23, 29),
	(6243, 'Vieš aký je rozdiel medzi dojčaťom a dospelým chlapom?\r\nPrakticky žiaden, obaja radi cmúľajú ženské bradavky.', 120, 2.84, 29),
	(6244, 'Hádajú sa traja chlapi, že čia žena má väčší zadok. Prvý vraví: \r\n- Ja keď idem do kina so svojou starou, tak jej musím kúpiť hneď dva lístky.\r\nDruhý sa na neho ohradí:\r\n- To je nič. Ja keď idem s rodinou na návštevu, tak moja žena si sadne na pohovku a ja s deťmi stojíme celý čas za ňou, lebo si nemáme kde sadnúť.\r\nA ten tretí sa len tak smutne pozrel a prehodil:\r\n- Moja žena má pekne oči.\r\n- Ale veď sa nerozprávame o očiach.\r\n- No hej, ale keď ostatné je ten zadok!', 513, 3.07, 29),
	(6245, 'Sedí bača nad priepasťou a stále opakuje 24,24,24,24,24.... Ide okolo turista a študovane sa na baču pozerá. Keď sa vracia, bača tam stále sedí a opakuje 24,24,24... To už turista nevydrží a príde bližšie k bačovi.\r\n"Pán bača, čo to počítate?"\r\nAle bača stále svoje 24,24,24... Nahne sa nad priepasť, aby zistil čo ten bača vlastne počíta. Zrazu pocíti ranu do chrbta, neudrží rovnováhu a už len padáááááááááááá. A bača 25,25,25,25,25.....', 487, 3.1, 29),
	(6246, 'Viete, čo je to "něco?"\r\nNěco je to, keď si chytím vtáka pravou rukou a k tomu aj ľavou rukou a ešte aj kus trčí.', 123, 2.89, 29),
	(6247, 'Viete, čo sa prihodilo mužovi, ktorému náhle kleslo IQ o 60%?\r\nUmrela mu žena.\n\r\nA viete, čo sa prihodilo mužovi, ktorému náhle kleslo IQ o 90 percent?\r\nUmrela mu žena a pes.', 184, 2.77, 29),
	(6248, 'Stretnú sa dvaja chlapi a jeden vraví druhému:\r\n- Mám tabletku na zmúdrenie. Jedna stojí tisíc korún.\r\n- Ty kokso, tak ja si kúpim päť za päťtisíc.\r\n- Fúúj, veď to je obyčajny celaskon.\r\n- No vidíš ako si zmúdrel!', 234, 3.02, 29),
	(6249, 'Rozprávajú sa dvaja pri pive:\r\n- Čo by si dal za moju ženu?\r\n- Nič.\r\n- Dohodnuté, ber si ju.', 98, 2.69, 29),
	(6250, 'Chlapík sedí na elektrickom kresle. Popravca už stláča vypínač, keď sa chlapíkovi začne čkať. \r\nPopravca sa pýta: "Máte nejaké posledné želanie?" \r\n"Áno... (hik)Mohli by ste (hik) Mohli by ste niečo urobiť, aby ste ma vystrašili?"', 251, 3.1, 29),
	(6251, 'Traja muži sú odsúdeni za ťažké zločiny do vezenia na 20 rokov. Každý z nich si môže doniesť do cely jednu vec. Prvý si zoberie so sebou veľkú kopu kníh. Druhý si zoberie manželku a tretí dvesto kartónov cigariet. \r\nPo 20 rokoch otvoria prvú celu a prvý muž vyjde a hovorí: \r\n"Študoval som tak ťažko,že môžem byť aj advokát." \r\nZ druhej cely vyjde muž a jeho manželka a majú 5 nových detí. \r\nMuz hovorí: "Bola to najkrajšia vec v mojom živote. Ja a moja manželka sme si boli tak blízko. Milujem to."\r\nOtvoria tretiu celu a muž v nej si potlapkuje po vreckách a hovorí: "Ma tu niekto zápalky?"', 638, 3.21, 29),
	(6252, 'V ktorých novinách si môžeme prečítať \'Žena vyhodila muža z okna\'?\r\nKrajšie bývanie.', 95, 3.29, 29),
	(6253, 'Lord Sedwich sa po svadobnej noci zobudil. Obrátil sa na svoju Lady: \r\n- Lady, dúfam, že ste zostala v druhom stave. \r\n- Prečo sa pýtate?\r\n- No, aby som nemusel tie smiešne pohyby opakovať ešte raz!', 206, 3.05, 29),
	(6254, 'Príde dedko do verejného domu, a zvolá:\r\n"Chcem ženu!"\r\nBordelmamá sa naňho milo usmeje a blahosklonne vraví:\r\n"Ale dedo, veď Vy to už máte dávno za sebou..."\r\n"Héj?...a koľko platím?"', 198, 3.28, 29),
	(6255, 'Stretnú sa dvaja kamaráti:\r\n- Čo máš nové?\r\n- Ale, včera mi vyšiel ďalší článok.\r\n- Nevedel som, že si novinár!\r\n- To nie, mám pásomnicu.', 154, 3.2, 29),
	(6256, 'Volá muž do erotického salónu. \r\nMuž: "Dobrý deň chcem si u Vás objednať jedno dievča."\r\nBordelMama: "Ale my dievčatá neposielame na byt."\r\nM: "Ale ja nemám nohy."\r\nBM: "Tak prídite na vozíčku."\r\nM: "Ale ja nemám ani ruky."\r\nBM: "A penis máte?" \r\nM: "A čo si myslíte, s čím som vytočil číslo?"', 318, 3.72, 29),
	(6257, 'Je jeden malý a jeden veľký muž na záchode a obidvaja mykajú s hlavami.Ten malý sa pýta toho veľkého:\r\n"Prečo mykáš hlavou?"\r\nTen veľký hovorí:\r\n"Ale, keď som bol vo vojne,trafili ma a od vtedy mykám hlavou."\r\nA ten veľký sa pýta toho malého:\r\n"A prečo ty mykáš hlavou?"\r\nA ten malý hovorí:\r\n"Ale, fŕkaš na mňa."', 342, 3.28, 29),
	(6258, 'Rozprávajú sa traja chlapi v krčme, čia manželka najviac kričí pri orgazme.\r\nPrvý hovorí: \r\n"Moja žena kričí tak, že ju počuť cez chodbu do vedľajšieho bytu."\r\n"To je nič", hovorí druhý. "Moja kričí tak, že ju počuť do vedľajšieho paneláka."\r\nTretí len mlčky počúva a potom prehodí: \r\n"Moja žena kričí tak silno, že ju počujem až sem do krčmy."', 384, 3.32, 29),
	(6259, 'V Bojnickej ZOO majú samicu gorily, ktorá je veľmi zlá a nadržaná, tak ju treba dať napáriť. Ale vhodný samec je až v Mníchove a stojí to 20 000 DEM. \r\nOšetrovateľ gorily sa dozvie, že na horehroní žije bača ZOOFIL a bude to stáť iba 500 SK. Tak mu zavolajú či môžu priniesť tú gorilu. Bača súhlasil avšak mal tri podmienky:\r\n1) urobím jej to iba zozadu\r\n2) nebudem sa s ňou bozkávať\r\n3) tých 500 Sk Vám dám až po výplate', 460, 3.36, 29),
	(6260, 'Viete čo je mobil? \r\nTo je jediná vec, pri ktorej sa muži hádajú, že ktorí ho má menší.', 97, 3.35, 29),
	(6261, 'Sedí chlap v autobuse a zazvoní mu mobil.\r\nChlap ho zdvihne a počuje:\r\n"Nazdar Fero."\r\nOn na to"\r\n"Ako si ma tu našiel?"', 124, 3.21, 29),
	(6262, 'Bača se oženil. Kamarádi se ho ptají, jaká byla svatební noc. \r\n"Normální. Nejdřív jsem si prdnul, aby si nemyslela, že jsem nesmelý, potom jsem ji dal přes hubu, aby si nemyslela, že se ji bojím, a pak jsem šel do chléva a ojel jsem ovci, aby si nemyslela, že jsem odkazaný jenom na ni..."', 309, 3.21, 29),
	(6263, 'Blonďák po dlhom pozeraní do IQ testu povie:\r\n"Jaj to treba doplňovať!"', 76, 3.26, 29),
	(6264, 'Žena leží v kóme a doktor už stratil vieru, že ožije tak hovorí sestre, aby ju umyla. Keď jej sestra prejde pomedzi nohy, tak naraz nabehne EKG. Sestra kričí: \r\n- Pán doktor, nabehlo EKG!\r\nDoktor hovorí manželovi:\r\n- Jediné, čo pomôže vašej manželke, je orálny sex. \r\nTak ich nechajú na chvíľu samých. Zrazu vyjde manžel a zapína si zips na nohaviciach:\r\n- No neviem, asi ju to zadusilo!', 414, 3.44, 29),
	(6265, 'Dvaja kamaráti sa rozprávajú:\r\n- Počúvaj, kedy si bol naposledy so ženskou?\r\n- Aj manželku mám počítať?', 114, 2.95, 29),
	(6266, 'Jeden pán si hľadá slipy. Popri tom si spieva:\r\n- Kde pak ty ptáčku hnízdo máš...', 89, 3.08, 29),
	(6267, 'Chlapík po rozvode sa po veľmi dlhej dobe dostal do situácie, keď musel ísť do drogérie kúpiť si kondómy. Za tie roky sa hodne zmenilo a tak si nechal poradiť od predavača. Ten mu vymenoval všetky druhy, čo mali. Chlapík si nechal poradiť, čo by bolo najlepšie. Predavač hovorí:\r\n- No, ja by som doporučil kondómy z ovčích črievok. Dávajú najprirodzenejší pôžitok.\r\nChlapík se hneď ozval:\r\n- No, neviem, pre mestkého chlapca ako som ja...', 472, 3.73, 29),
	(6268, 'Prídu cigáni za belochom a hovoria:\r\n- Zaspievaj nám Máriu, Máriu modroočko.\r\nBeloch hovorí:\r\n- Ale ja nie som modroočko.\r\nBUM-BÁC,BUM-BÁC.\r\n- Mária, Mária...', 170, 2.77, 29),
	(6269, 'Dvaja chlapi sa sprchujú. Jeden vraví druhému:\r\n"Ty si robíš dobre?"\r\n"A čo je teba do toho ako rýchlo sa mydlím!"', 122, 3.56, 29),
	(6270, 'Stretnú sa dvaja koktavý. Prvý sa smeje druhému: \r\n- Kým ti povieš uuužovka, tak je už dávno preč!\r\n- Ha-ha-ha ty sa mi nesmej. Kým ty povieš svojej starej ukáž mi tu tvoju pipipipi...., tak máš plnú kuchyňu sliepok.', 234, 3.5, 29),
	(6271, 'Príde malý chlapík do krčmy a zreve:\r\n"Kto chce riadne po paluli?"\r\nVšetci ticho.\r\n"Tak kto chce riadne po papuli?"\r\nV tom sa zodvihne spoza stola chlapisko ako hora a hovorí:\r\n"Ja!"\r\n"Dobre,tak choď von,ja som už dostal!"', 230, 3.3, 29),
	(6272, 'Dvaja kamaráti sedia v krčme a jeden z nich hovorí:\r\n- Tak ja ti tomu nerozumiem. Ja donesiem domov 5000sk a moja žena 3000sk. Osem stovák dostaneme na vrátených fľašiach a nie a nie vyžiť.', 200, 3.5, 29),
	(6273, '- Pišta? - kričí sused na suseda v záhrade. Tvoja žena bola vo Francúzsku?\r\n- Ale čoby! To som ju ja naučil.', 116, 2.99, 29),
	(6274, 'Uloví rybár zlatú rybku.Zlatá rybka ho prosí:\r\n"Prosím ťa nezabíjaj ma splním ti želanie."\r\n"Ja ťa nezabijem, ale tamtomu rybárovi tam nižšie splníš to, čo si zaželá ako prvé, keď sa zobudí."\r\nRybár sa ráno zobudí a hovorí:\r\n"Sto nožov do chrbta a sekera do hlavy."', 292, 3.46, 29),
	(6275, 'Stojí chlapík pred nebeskou bránou a Svätý Peter mu vraví: \r\n- Ak mi povieš jeden skutočne dobrý skutok, ktorý si vykonal, tak ťa pustím do neba. \r\nChlapík sa zamyslí a povie: \r\n- Žiadny problém. Raz som videl ako motokársky gang obťažuje mladú ženu. Prišiel som k ním a vravím asi dvojmetrovému, 150 kilovému chlapíkovi, aby prestal. Potom som mu dal jednu po papuli, vytrhol mu piercing z nosa a kopol do vajec. \r\nSvätý Peter pozerá do chlapíkovej knihy života a vraví:\r\n- Takú príhodu tu nemôžem nájsť, kedy sa to stalo? \r\n- Asi pred piatimi minútami.', 594, 3.59, 29),
	(6276, 'Dvorenie vo Veľkej Británii:\r\n- Pán Smith, slnečný jas v očiach vašej dcéry a teplý vánok jej úsmevu dokonale rozplynú čierne mraky môjho života.\r\n- Počujte mladý pán, to má byť žiadosť o ruku mojej dcéry alebo predpoveď počasia?', 254, 3.43, 29),
	(6277, 'Keď chlap súloží, ktorý jeho sval ja najviac namáhaný?\r\nKonečník. Aby sa od radosti  neposral...', 105, 3.26, 29),
	(6278, 'Rady per mužov:\r\nNepríjemný dym z cigariet zmizne, keď v miestnosti zapálime umelohmotnú fľašu od minerálky.\r\nŠkvrny zo zašpinených kobercov najlepšie odstránime nožom.\r\nPríliš veľkého hluku z chladničky sa zbavíme, ak ju vytiahneme zo zásuvky.\r\nSneh z chodníku pred domom najlepšie odstránime, keď počkáme na jar.\r\nRyhy na poškriabaných sklách okuliarov sa zbavíme použitím navlhčeného brúsneho papiera.\r\nPri bolesti zubov kloktáme savo, zuby čoskoro vypadajú a nebolia.\r\nNepríjemný cesnakový zápach z úst zaženieme následnou konzumáciou olomouckých syrečkov s rumom.\r\nŠoku z vysokého účtu v reštaurácii takticky predídeme spitím sa do nemoty.\r\nAk si zabuchneme v byte kľúče od dverí, tak sme v prdeli.', 765, 2.92, 29),
	(6279, 'Kovboj chytá ryby a zrazu sa v jeho sieti ocitne zlatá rybka. Tá ho prosí, aby ju pustil, že ona mu splni tri želania. Tak že dobre.\r\nKovboj hovorí: "Chcem vždy keď prídem do baru vytĺcť všetkých v ňom."\r\n"Bude splnené",povedala rybka. \r\n"Moje druhé želanie", hovorí kovboj, "bude, že keď v bare zbadám nejakú super kočku žmurknem na ňu, tak pôjde so mnou. A tretie, chcem ho mať ako môj kôň."\r\nRybka splnila, čo sľúbila a kovboj ju pustil.\r\nPríde si on teda do toho baru, vytlčie všetkých chlapov, žmurkne na babu idú spolu hore, vyzlečú sa a ona odpadne. Znova príde do druhého baru, tu tiež všetkých zmastí hlava nehlava, žmurkne na babu idú hore a tá tam zase odpadne.\r\nDo tretice príde kovboj do baru, zase všetkých zmastí, opäť žmurkne na babu, idú hore a zas odpadne. V tom sa kovboj pozrie medzi nohy a vraví:\r\n"Už desať rokov jazdím na svojom koňovi, no až teraz som zistil, že je to kobyla."', 968, 3.12, 29),
	(6280, 'Boh hovorí Adamovi. \r\n- Mám pre teba dve správy, jedna je dobrá a druhá zlá. \r\nTakže najprv tá dobrá \r\n- Máš dva vínimočná orgány: penis a mozog .\r\nTeraz tá zlá: \r\n- Málo krvi nikdy nebudu fungovať naraz .', 224, 3.45, 29),
	(6281, 'Ide si tak chlapík popri plote a zrazu sa mu chce strašne čúrať.\r\nUvidí v plote dieru, tak ho tam fukne a čúra.\r\nAko tak čúra, spozoruje cez plot v záhrade kozu, ako sa k nemu blíži.\r\nA kričí:\r\nKoza, choď preč, nepočuješ, koza jedna, koza,kozička.... kooozenkaa moja zlatá.', 294, 4.02, 29),
	(6282, '"Pán hlavný, rýchlo polievku, než sa začne škandál!"\r\nDožaduje sa rázny hosť v reštaurácii.\r\nPo rýchlom obslúžení sa to znova zopakuje:\r\n"Rýchlo rezeň, než sa začne škandál!"\r\nHlavný sa ide potrhať a zabrňuje škandálu aj zákuskom a pivom. Potom sa osmelí:\r\n"A môžete mi prezradiť, prečo by mal byť ten škandál?"\r\n"Už sa začína", ubezpečuje ho hosť.\r\n"Nemám čím plaťiť!"', 415, 3.23, 29),
	(6283, 'Pýtali sa Francúza, Angličana a Rusa prečo spávajú so starými ženami.\r\nFrancúz hovorí: \r\n"Spávam so starou ženou preto, lebo sa vie perfektne milovať."\r\nAngličan hovorí: \r\n"Ja spávam so starou ženou preto, lebo je bohatá."\r\nRus odpovedá: \r\n"Viete, to je tak. Ležíš pri nej, a myslíš si, a možno Lenina videla..."', 337, 2.96, 29),
	(6284, 'Značkovanie\r\nPýta sa farár kovboja.\r\n"John, označil si včera všetky zvieratá, ako som ti predvečerom prikázal?"\r\n"Označil."\r\n"A mal si s tým veľa roboty?"\r\n"S dobytkom ani nie, ale s tými včelami to bolo strašné."', 229, 3.27, 29),
	(6285, 'Vojde chlapík do krčmy:\r\n"Prepáčte, tu je zjazd pehatých?"\r\n"Nie, niekto sa nám vysral do ventilátora!!!"', 112, 3.5, 29),
	(6286, 'Mladý vojak príde na základňu v púšti.\r\nPýta sa kapitána:\r\n"Šéfe, ako to tu môžete vydržať bez žien?"\r\n"Dá sa, ale keď ti budú už veľmi chýbať, v maštali máš ťavu a tu použi."\r\nNajprv sa mu to protivi, ale po dlhom čase predsa len príde k ťave.\r\nKeď sa už vracia celý špinavý a spotený, spýta sa kapitána:\r\n"Šéfe, ako to robíte?"\r\n"Normálne, sadneme na ťavu a ideme do mesta."', 419, 3.57, 29),
	(6287, 'Ide Pepo po ulici a vidí Alexa a pýta sa ho:\r\n"Ty, Alex, nevieš kde býva Pepo?"\r\n"Čo ti šibe, veď ty si Pepo."\r\n"Ale ja sa ťa nepýtam kto som, ale kde bývam."', 168, 3.51, 29),
	(6288, 'Jeden škót sa dožil 106 rokov. Novinári sa ho pýtajú:\r\n- Povedzte nám prosím, ako sa vám podarilo dožiť sa takého vysokého veku?\r\n- No, už dlhší čas nefajčím, som skoro vegetarián, všade chodím pešo a spávať chodím, keď sa zotmie.\r\n- Aha. Teda sa snažíte zdravo žiť, však?\r\n- Ani nie. Ale viete, pri dnešných cenách cigariet, mäsa, benzínu a elektriny... ', 392, 3.2, 29),
	(6289, 'Starý skúsený námorník príde po namáhavej celodennej práci do kajuty. Sadne si na posteľ a otočí ruky. Na jednej má napísané Katka a na druhej Marienka. Námorník sa pozrie na ruky a hovorí:\r\n- Tak dievčatá, ktorá z vás to bude dnes?', 253, 3.03, 29),
	(6290, 'Kedy sa muž cíti ako lev?\r\nKeď má na chvoste peknú štetku.', 64, 3.29, 29),
	(6291, 'Dcéra sa pýta otca: \r\n- Oci, čo je to penis?\r\nOtec jej povie nech sa pozerá, a ukáže jej ho. Na druhý deň dievča s radosťou povie spolužiačkam: \r\n- Dievky už viem čo je to penis.\r\n- No čo? Povedz.\r\n- Je to niečo také ako vták, len trochu menšie.', 264, 2.98, 29),
	(6292, 'Zo stroskotanej lode doplávu na opustený ostrov traja chlapíci. Začnú chytať ryby a chytia zlatú rybku. Ona hovorí:\r\n- Splním vám každému jedno želanie.\r\nPrvý:\r\n- Chcem byť doma s rodinou.\r\n"Bum" a stalo sa.\r\nDruhý:\r\n- Aj ja chcem byť doma s rodinou.\r\n"Bum" a stalo sa.\r\nTretí:\r\n- A ja tu budem sám? Tak chcem naspäť tých dvoch.', 350, 2.97, 29),
	(6293, 'Sedia na skale američan, rus, čech a slovák. Vidí ich diabol a rozhodne sa ich pokúšať.\r\nPríde k američanovi a hovorí:\r\n- Dám ti milión dolárov, keď skočíš.\r\n- Hmm, hovoríš milión... Dobre teda.\r\nA skočí. Diabol podíde k rusovi a tiež mu hovorí:\r\n- Dám ti milión dolárov, keď skočíš.\r\n- Čo ti šije? Veď sa zabijem.\r\n- Tak skoč za vlasť.\r\n- Hmm, tak dobre.\r\nA skočí. Diabol podíde k čechovi a zasa sa to zopakuje.\r\n- Dám ti milión, keď skočíš.\r\n- Si blbý? Veď sa zabijem.\r\n- Tak skoč za vlasť.\r\n- Na tú ti kašlem.\r\n- Ale aspoň zabezpečíš rodinu.\r\n- To je pravda.\r\n- A dokonca je to zadarmo.\r\n- Tak teda dobre.\r\nA skočí. Nato podíde diabol k slovákovi, a ten mu takisto hovorí, že neskočí, na vlasť i na rodinu kašle. Diabol sa otočí a povie: \r\n- No, čo už s tebou, keď neskočíš...\r\n- Ja že neskočím?', 876, 3.28, 29),
	(6294, 'Stretnú  sa  dvaja kámoši v saune. Pýta sa jeden druhého: \r\n- Ty počuj, prečo to máš také veľké?\r\n- No, moja mama mi tak často nekupovala hračky.', 159, 3.03, 29),
	(6295, 'Má vplyv pánska spodná bielizeň na zníženú potenciu?\r\nNie, ale ako výhovorka je to dobré.', 98, 3.11, 29),
	(6296, 'Muži nestarnú, muži slabnú...', 33, 3.16, 29),
	(6297, 'Stvoriteľ hovorí Adamovi:\r\n"Mám pre teba 2 správy."\r\nDobrá:\r\n"Dal som ti dva orgány-mozog a penis."\r\nZlá:\r\n"Nedal som ti dosť krvi, aby si ich mohol používať súčastne."', 181, 3.52, 29),
	(6298, 'Sedí kovboj v bare a popíja whisky. Prisadne si k nemu lesba a vraví: "Ty si kovboj?"\r\n"Áno,celý deň jazdím na ranči a zaháňam kone. A Ty si kto?"\r\n"Ja som lesba! Celý deň myslím na ženy. Ráno, keď vstanem - myslím na ženy. Naobed,pri jedle - myslím na ženy. Večer, keď idem spať - myslím na ženy."\r\nLesba dopila a odišla.O chvíľu si ku kovbojovi prisadne chlap a pýta sa:\r\n"Ty si kovboj?"\r\n"Myslel som si, že áno, ale teraz som zistil, že som lesba!"', 483, 3.2, 29),
	(6299, 'V noci budí otec syna s krikom:\r\n- Máš štrnásť rokov a čo si dokázal?! Ja v tvojom veku...  Gagarin dvakrát obletel zemeguľu!', 135, 2.86, 29),
	(6300, 'V chudobnej dedine, kde nemajú čo jesť, sa rozprávajú dvaja chlapi.\r\n- Čo robíš?\r\n- Hovno!\r\n- A kde na to berieš materiál?', 132, 3.25, 29),
	(6301, 'Príde chlap do hotela a chce sa ubytovať.\r\n- Pane, máme iba jedno voľné miesto. Pri pánovi Novákovi, ale ten strašne chrápe! Tam sa nevyspite! Tam nikto nevydržal!\r\n- Nevadí! Ja som veľmi unavený a nikde nemali nič voľné. Beriem to!\r\nNa druhý deň ráno chlap odchádza spokojný a vysmiaty. Recepčná sa ho pýta:\r\n- Vyspali ste sa dobre? Pán Novák vás nevyrušoval?\r\n- Ale čoby! Večer, keď vyšiel zo sprchy, som mu dal božtek na uško! Osprchoval som sa a zaľahol spať! Pán Novák sa bál celú noc čo i len očko zažmúriť a nieto ešte chrápať!', 582, 3.15, 29),
	(6302, 'Rozprávajú sa dvaja kolegovia:\r\n- Ach bože, ja sa už neviem dočkať, kedy už konečne stiahnem manželkine nohavičky.\r\n- Ty si vážne taky nadržaný?\r\n- Vôbec nie! Len ma strašne režú v zadku.', 205, 3.16, 29),
	(6303, 'Muž je ako video: dopredu, dozadu, STOP a EJECT.', 49, 3.24, 29),
	(6304, '- Som počul, že ideš na zabíjačku.\r\nHovorí kamarát kamarátovi.\r\n- No to hej, idem. \r\nA vtom sa do rozhovoru pridá ďaľší...\r\n- Nezohnali prasa, tak pozvali teba!  \n', 176, 3.09, 29),
	(6305, 'Napis nad pisoárom na mužskom WC:\r\n"Nenamýšľaj si a prístup bližšie."', 77, 3.81, 29),
	(6306, 'Ide bača od lekára na salaš a s nohami naširoko od seba. Honelníci sa dívajú na baču a pýtajú sa ho. \r\n- Ej, bača a čože sa vám stalo, že tak naširoko chodíte? \r\n- Ále, lekár mi zistil vysoký cholesterol a povedal, že sa vajec nemám ani dotknúť.', 269, 3.24, 29),
	(6307, 'Ide dedo po parku a vidí malého chlapčeka, ako sedí na lavičke a plače. Tak sa ho teda pýta: \r\n- Chlapček, prečo plačeš?\r\n- Lebo nemôžem robiť veci, čo robia veľký chlapci!\r\nI sadol si dedko k nemu a plakal s ním.', 231, 3.5, 29),
	(6308, 'Príde muž do krčmi a hovorí:\r\n- Niektoré veci sa nedajú vysvetliť, niektoré veci sa nedajú vysvetliť. Krčmár, nalej poldeci.\r\nKeď si to tak povie už po piaty krát, krčmára to naštve a hovorí:\r\n- Ak mi nepovieš, prečo v kuse hovoríš, že niektoré veci sa nedajú vysvetliť, tak ti už nenalejem.\r\n- No dobre. Ako každé ráno, idem do maštale podojiť kravu a ona potvora stále kopala nohou, tak som jej ju priviazal o stĺpik. No ale ona začala kopať druhou nohou, a tak som jej ju taktiež priviazal o druhý stĺpik. A keď sa začala oháňať chvostom, tak som si dal dole opasok a priviazal som jej ho o hák na strope. A čo čert nechcel, ako som bol tak otočený ku krave, spadli mi nohavice a do maštale vošla moja žena. No a niektoré veci jednoducho nevysvetlíš.', 809, 3.73, 29),
	(6309, '- Prečo tú sliepku držíš za krk?\r\n- Varím podľa kuchárskej knihy. Tam je napísané: Sliepku pol hodiny mierne dusíme.', 127, 3.31, 29),
	(6310, 'Príde chlap k doktorovi a sťažuje sa:\r\n- Pán doktor, trpím kvadratickou chorobou!\r\n- A to je čo? - pýta sa prekvapený doktor.\r\n- Ale, mám stále chuť na druhú!', 170, 3.37, 29),
	(6311, 'Chlapík nervózne otvorí dvere, lebo niekto zvoní. Vykukne, pozrie, skloní hlavu a tam... malá smrťka. Tá vraví:\r\n- Prišla som si po vášho papagája.\r\nChlapík sa na ňu pozrie, urobí grimasu a zabuchne dvere! O pol hodinu znovu niekto zvoní. Muž opäť nervózne otvorí. Pred dverami stojí mala smrťka a veľká smrťka. Malá smrťka ukazuje naňho a hovorí:\r\n- To je on!', 391, 3.31, 29),
	(6312, 'Príde chlapík z krčmy domov a žena naňho kričí:\r\n- Kúpil si chlieb?\r\n- Nekúpil. A odteraz nebudem robiť žiadne ženské práce.\r\nŽena sa začala vyzliekať a hovorí:\r\n- Tak poď robiť mužskú prácu.\r\n- Čo nepoznáš srandu? Davaj tašku a peniaze, idem kúpiť ten chlieb.', 289, 3.24, 29),
	(6313, 'Na matriku príde pán a chce si zmeniť meno. Matrikárka sa pýta:\r\n- A ako sa voláte? \r\n- Ján Hovno. \r\n- No to je fakt nepekné meno a ako ho chcete zmeniť? \r\n- Na Jožko.', 177, 3.15, 29),
	(6314, 'Svokor hovorí zaťovi:\r\n"Chcel by som aby si bol mojím prirodzením."\r\n"A to už prečo?"\r\n"Už by si päť rokov visel."', 123, 3.24, 29),
	(6315, 'Karol robil pilotné skúšky a kamaráti sa ho pýtajú: \r\n- Boli tažké skúšky? \r\n- Nie, ale naštval som jedného grafológa. \r\n- Čo hovoril? \r\n- Ale, vraj podľa rukopisu som násilník, grobian a bitkár. \r\n- A čo si mu povedal? \r\n- Čo? Rozbil som mu hubu. ', 268, 3.1, 29),
	(6316, 'Víte proč mají chlapi o kolečko víc než psy?\r\nAby nelítali kolem dokola, když si honí ocas!', 100, 3.3, 29),
	(6317, 'Francek ukradol pánovi farárovi topánky, no na druhý deň mu ich vrátil. O všetkom vedel jeho kamarát Jožo:\r\n- Ty, Francku. Teba muselo riadne tlačit svjedomí, keď si mu ty boty tak rýchlo vráceu. \r\n- Svjedomí ne, ale ty boty ano.', 244, 3.33, 29),
	(6318, '- Už si spal s mojou ženou?\r\n- Čo si ?! Nie.\r\n- To by si mal, lebo moja je lepšia ako Tvoja.', 96, 3.48, 29),
	(6319, 'Dvaja horolezci na zvislej stene. Horný hovorí spodnému:\r\n- Strašne sa mi chce čúrať, čo mám robiť? \r\n- Musíš vydržať. Skús autosugesciu. Opakuj si, že sa ti nechce. \r\n- Nechce sa mi čúrať, nechce sa mi čúrať...\r\nPo chvíli sa ten spodný pridá: \r\n- Netečie na mňa, netečie na mňa...', 310, 3.18, 29),
	(6320, 'Ako si muž predstavuje jedlo so šiestimi chodmi?\r\nPizza a päť plechoviek piva.', 82, 3.13, 29),
	(6321, 'Prečo majú muži nohy?\r\nAby si rozum neťahali po zemi.', 57, 2.81, 29),
	(6322, 'Vieš ako zistíš, ktorý z 10 chlapov je blbec?\r\nNámatkou.', 61, 3.15, 29),
	(6323, 'Baví se v hospodě dva kamarádi.\r\n"Ty Josef, slyšel jsem, že tvoje stará dobře šuká."\r\n"Já ti nevím, jeden říká tak, druhý zase onak."', 148, 3.15, 29),
	(6324, '- Otec, tak som po tom.\r\n- Ale to je skvelé, tak to už si hotový chlap, no to mi musíš porozprávať! Tak poď sem a sadni si.\r\n- No vidíš, tak to je práve to, čo nemôžem.', 182, 3, 29),
	(6325, 'Ktoré dve rastlinky majú muži najradšej?\r\nChmeľ a tabak.', 61, 2.79, 29),
	(6326, 'Muž hovorí svojmu priateľovi:\r\n- No vieš, moja žena chcela k narodeninám niečo zlaté.\r\n- A čo si jej kúpil, čo?\r\n- Zlaté stránky.', 142, 2.85, 29),
	(6327, 'Jano si dá oholiť hlavu. Ide k Ferovi a ten mu vraví:\r\n- Jano! Veď ti máš hlavu hladkú ako zadok mojej manželky!\r\nJano si chytí hlavu a hovorí: \r\n- A naozaj!', 167, 2.99, 29),
	(6328, 'Budí policajt bezdomovca v parku na lavičke:\r\n- Čo je to tu nocľaháreň alebo čo?\r\nRozospatý bezdomovec sa osopí:\r\n- A čo som ja informátor?', 150, 3.25, 29),
	(6329, 'Prečo muž po päťdesiatke nedostane AIDS?\r\nPretože ho nedostane ani v špajzi ani v chladničke.', 100, 3.09, 29),
	(6330, 'Viete prečo chlapi nemôžu dostať chorobu šialených kráv?\r\nLebo všetci sú svine.', 88, 3.46, 29),
	(6331, 'Viete prečo sa muži škrabú medzi nohami?\r\nAby si ženy mysleli, že tam niečo majú.', 89, 3.15, 29),
	(6332, 'Čo majú muži v hlave?\r\nChrobáka mozgožrúta. A čo tam robí? Umiera hladom...', 83, 3.13, 29),
	(6333, 'Viete prečo muži masturbujú?\r\nLebo majú konečne dobrý sex s niekým, koho milujú.', 88, 3.19, 29),
	(6334, 'Prečo Pán Boh stvoril prvého muža?\r\nLebo vždy sa začína od 0.', 68, 3.07, 29),
	(6335, 'Dvaja sa bavia pri pivečku:\r\n- Človeče, tak som si ti raz pomýlil manželku so zlodejom. To si mal vidieť, ako sa bránila, ako kričala, keď som ju vyhadzoval z okna...\r\n- To nič nie je. To ja som si raz pomýlil zlodeja s manželkou. A to si mal vidieť, ako sa bránil, ako kričal...', 294, 3.53, 29),
	(6336, 'Viete čo je to maximálna ohybnosť ?\r\nObčúrať si chrbát.      ', 68, 3.07, 29),
	(6337, 'Stejně ten Pán Búh stvoril tu Evu jen proto, že videl, jak je ten blbec Adam nedokonalý.', 93, 3.21, 29),
	(6338, 'Baví se tři v hospodě koho žena nejvíc křičí pri orgasmu.Jeden říka\r\n"Ta ma křičí, že ji musím ucpat pusu dreveným kolíkem,aby se nevzbudili sousedi.\r\nDruhý říká:\r\n"To nic není,ja musím dát drevený kolík do pusy a ješte privázat k posteli, aby nevzbudila sousedy a nerozbila všechno okolo sebe."\r\nTřetí říká:\r\n"To vúbec nic není. Když moje žena křičí pri orgasmu tak ja to slyším tady v hospode."', 439, 3.02, 29),
	(6339, 'Dva chlapi seděj v hospodě. Ten první říká tomu druhýmu\r\n"Moje žena je hotovej poklad."\r\nA ten druhej se na chvíli zamyslí a pak se zeptá! \r\n"Kde jsi ji vykopal?"', 173, 3.15, 29),
	(6340, '- Drahá, myslíš na to isté, čo ja?\r\n- Áno, drahý.\r\n- Tak poďme na futbal.', 81, 2.79, 29),
	(6341, '- Platíš aj ty dane?\r\n- Áno, platím. A platím aj Jane, Alici a Lucii.', 74, 2.99, 29),
	(6342, 'Cez inzerát som sa zoznámil s troma ženami. Vymyslel som si malý test, podľa ktorého si vyberiem tú najlepšiu. Každej z nich som dal 10 000.- korún a počkal, čo s nimi urobia. Prvá si za ne kúpila kožuch. Druhá mi za ne kúpila celoročnú vstupenku na zápasy môjho obľúbeného mužstva. Tretia peniaze investovala a po krátkom čase mi vrátila 10-násobnú sumu. Po dlhom zvažovaní a premýšľaní som sa rozhodol pre tú s najväčšími kozami.', 472, 3.18, 29),
	(6343, 'Je január, vonku padá sneh a mrzne. Otec troch detí si ich zavolá a hovorí:\r\n- Tak, teraz všetci do plaviek a von! Je tu ešte pol balenia kvapiek proti kašlú. Bude veľká škoda, keď sa pokazia!', 205, 3.09, 29),
	(6344, 'Malý Jurko hrá na husliach a robí strašný rámus. Keď to zistí jeho otec, nahnevaný vbehne do jeho izby a skríkne:\r\n- To mi nemôžeš povedať, že hráš na husliach? Ja už tu pol hodiny márne olejujem dvere!', 221, 2.98, 29),
	(6345, 'Rus, Nemec a Slovák sa nevedia dohodnúť, ktorý z nich má lepšiu mušku.\r\nStrieľa Rus - na 100m trafí lukom jeleňa.\r\nStrieľa Nemec - na 100m trafí lukom zajaca.\r\nSlovák sa začne smiať, zoberie valašku a rečie:\r\n- Vidíte toho komára?\r\n- No a?\r\n- Tak sa pozerajte.  - povedal a hodil valašku.\r\n- Ale veď ten komár letí ďalej!\r\n- Letí, ale bez vtáka!', 371, 3.29, 29),
	(6346, 'Chlapík príde po smrti do pekla. Čert sediaci pri vstupnej bráne sa ho pýta : \r\n"Prečo si taký smutný?"\r\nChlapík odpovie : \r\n"Prečo asi, čo myslíš? Som predsa v pekle!"\r\n"V pekle nie je tak zle," odpovie čert. "Máme tu veľa zábavy. Vypiješ si rád?"\r\n"Jasné," odpovie chlapk, " veľmi rád si vypijem."\r\n"Tak potom budeš mať rád pondelky. V pondelok všetko čo robíme je to, že pijeme celý deň. Whiskey, tequilu, vodku, rum, víno, pivo, ... Pijeme pokiaľ vládzeme a potom pijeme ešte viac!"\r\n"Hmmm, to znie vynikajúco.\r\n"Fajčíš?" pýta sa čert ďalej. \r\n"No jasnačka!" \r\n"Tak potom budeš mať rád utorky. Vtedy fajčíme tie najlepšie cigáry z celého sveta, až pokiaľ si neprefajčíme pľúca. Ak náhodou dostaneš rakovinu, nič sa nedeje, pretože si už mŕtvy.\r\n"No to je paráda!" \r\nČert pokračuje. \r\n"Stavím sa, že si rád zahráš hazardné hry." \r\n"Áno, v podstate som tak trošku gambler." \r\n"V stredu si môžeš zahrať čo len chceš. Škrupinky, blackjack, poker, ruleta, automaty, proste všetko. A čo takto drogy?\r\nChlapík odpovie, "Beriem drogy. Nechceš mi povedať, že ..." \r\n"Presne tak! Štvrtok je drogový deň. Môžeš si dať hoc aj zlatú dávku, veď aj tak si mŕtvy. \r\n"Perfektné," hovorí chlapík veselšie, uvedomujúc si tieto výhody, " nikdy som nepredpokladal,že peklo je také perfektné miesto!"\r\nČert sa pýta, "Si gay?" \r\n"Nie." \r\n"Ooooh, tak potom asi budeš nenávidieť piatky."', 1478, 3.49, 29),
	(6347, 'Aký je rozdiel medzi mužom a vibrátorom?\r\nVibrátor nevie pokosiť trávnik.', 79, 2.72, 29),
	(6348, 'Viete prečo ženy predstierajú orgazmus?\r\nPretože si myslia, že mužov to zaujíma!', 87, 3.02, 29),
	(6349, 'Vo vojenských sprchách sa sprchuje chlap s dvojcentimetrovým penisom. Ostatní po ňom stále pozerajú, až to ten nevydrží a spýta sa:\r\n- No čo je? Ešte ste nevideli chlapa s postaveným vtákom?', 205, 2.99, 29),
	(6350, 'Koľko ozajstných mužov je potrebné na vymenenie žiarovky?\r\nAni jeden. Ozajstný muž sa tmy nebojí.', 105, 2.93, 29),
	(6351, 'Telefonuje chlap do mäsiarstva:\r\n- Máte bravčové paprčky?\r\n- Máme.\r\n- Máte aj bravčový rypák?\r\n- Máme.\r\n- Pane bože, vy musíte vyzerať !', 150, 3.43, 29),
	(6352, 'V staničnej reštaurácii sedí starší manželský pár. Príde k nim čašník a pýta sa, čo si budú priať. Stará pani hovorí:\r\n- Ja si dam párky.\r\nA čašník odpovie otázkou: \r\n- Aj chren? \r\nA stará pani hovorí:\r\n- Áno, aj chren si dá parky.', 259, 3.24, 29),
	(6353, 'Aký je rozdiel medzi mužom a pávom?\r\nŽiaden.\r\nKapacitu mozgu majú rovnakú a chvosty iba na výstavu.', 106, 3.18, 29),
	(6354, 'Pýta sa Janko Fera:\r\n- Fero, kde pracuješ? \r\n- Na letisku.\r\n- A čo tam robíš? \r\n- Lietam s fúrikom.', 105, 3.13, 29),
	(6355, 'V galérii chlap zastane pred jedným obrazom a kričí na sprievodcu:\r\n- Tejto hrôze hovoríte moderne umenie?!\r\n- Nie, tejto hrôze hovoríme zrkadlo.', 153, 2.92, 29),
	(6356, '- Šesť rokov som nepil, nefajčil a nebehal za ženami.\r\n- Preboha a čo ti bolo?\r\n- Nič, potom som začal chodiť do základnej školy.', 139, 3, 29),
	(6357, '- Už máme kávu bez kofeínu, čaj bez teínu, mlieko bez tuku, cigarety bez nikotínu, tak čo do pekla máte stále proti nám?! - rozčuľuje sa impotent.', 159, 2.76, 29),
	(6358, '- Pán vrchný, pán vrchný, poďte prosím rýchlo sem! - kričí hosť.\r\nVrchný príde k stolu a pýta sa:\r\n- Čo sa robí, pane?"\r\nHosť znepokojene hovorí:\r\n- Tá káva, čo ste mi pred chvíľou doniesli, sa nedá piť. Je ju cítiť po ženskom pohlaví.\r\nVrchný chytí šálku, ovonia kávu a odpovie: \r\n- Pane, chyťte tú šálku druhou rukou a môžete kávu piť.', 378, 2.72, 29),
	(6359, 'Viete, prečo sa chlapi môžu kúpať v teplej vode len sedem minút? \r\nLebo párok po siedmich minútach praská a vajcia sú na tvrdo.', 137, 3.04, 29),
	(6360, 'Príde chlapík na wc, lenže už trochu neskoro, rozopína si už mokré nohavice, keď si všimne vedľa stojaceho chlapíka, ako neveriaco krúti hlavou.\r\n"No vyčúrať sa už nemusím, tak si aspoň prdnem.",\r\nhovorí si. Lenže ako tak tlačí, tak sa poserie. Urobilo sa mu z toho zle a tak sa pogrcal a nad tou hanbou sa ešte rozplakal. Lenže pritom nemohol dýchať, a tak sa ešte posmŕkal. Vtom mu druhý chlapík, ktorý ho celý čas pozoroval, hovorí:\r\n"Ty a s ušami niečo nevieš?"', 502, 3.11, 29),
	(6361, 'Dvaja rytieri tiahnu na krížovú výpravu a jeden z nich, ktorý má hrozne škaredú ženu hovorí druhému:\r\n"Keď som odchádzal, dal som svojej starej pás cudnosti."\r\n"Ale veď to snáď ani nie je treba."\r\n"Nevadí, keď sa vrátim domov, poviem jej že som stratil kľúč."', 283, 2.84, 29),
	(6362, 'Chcel by som zomrieť v kľude a v spánku ako môj strýko. A nie ukričaný a vystresovaný ako tí ľudia, ktorým šoféroval autobus.', 138, 3.63, 29),
	(6363, 'Rozprávajú sa dvaja slobodní kamaráti:\r\n- Nerád som chodieval na svadby.\r\n- A prečo?\r\n- Stále mi babky hovorili, že možno práve ja budem ten nasledujúci!\r\n- A už ti dali pokoj?\r\n- No jasné! Od kedy hovorievam na pohreboch, že možno ty budeš tá nasledujúca!', 274, 2.96, 29),
	(6364, 'Sedí muž v bare a vedľa si prisadne muž s krabicou, v ktorej dve malé postavičky hrajú tenis. Muž sa ho pýta.\r\n"Odkiaľ máte taký tenis?"\r\n"Mám doma zázračného džina, ktorý mi splní každé želanie."\r\n"A nemohli by ste mi ho na jedno želanie požičať?"\r\n"Ale áno samozrejme."\r\nMuž príde domov s džinom, ktorý už vyliezol s flašky. Muž mu hovorí.\r\n"Chcem milión amerických doláčikov!"\r\nZrazu je izba plná amerických koláčikov. Na druhý deň  príde muž nazlostený do baru a hovorí tomu druhému.\r\n"To si mi nemohol povedať, že ten džin je nahluchlý?"\r\n"Ja som tiež nechcel 30-centimetrový tenis!"', 644, 3.42, 29),
	(6365, '- Jano, čo si taky smutný?\r\n- Ale prosím ťa, uleteli mi včely.\r\n- Zožeň si filcky, sú vernejšie.', 105, 3.02, 29),
	(6366, 'Prečo sa mužská inteligencia nedá zaplatiť peniazmi?\r\nLebo taká malá minca predsa neexistuje!', 100, 2.77, 29),
	(6367, 'Prečo Boh stvoril muža?\r\nPretože nedokázal gorilu naučiť kosiť trávnik!', 79, 2.66, 29),
	(6368, 'Príde chlapík, starý mládenec, k doktorovi, že má oranžový penis.\r\n- A čo robievate po večeroch? - pýta sa doktor.\r\n- Pozerám porno a jem paprikové chipsy.', 168, 3.28, 29),
	(6369, 'Príde dedko do autobusu a strašne si prdne. Všetci ľudia začnú čuchať a pozerať sa na dedka. Detko to už nevydrží a povie:\r\n- Čuchať by ste čuchali. Ale prdnúť nemá kto.', 187, 3.81, 29),
	(6370, 'Muži sú ako anjeli, ktorí nám spadli z neba.\r\n...ale prečo rovno na hlavu?', 79, 3.08, 29),
	(6371, 'Tučný muž stojí pred školou a učiteľka sa ho pýta:\r\n"Čakáte dieťa?"\r\n"Nie, brucho mám od piva."', 107, 2.85, 29),
	(6372, 'Rozprávajú sa dvaja kovboji. Prvý sa chváli:\r\n- Ja mám najrýchlejšiu ruku na divokom západe...\r\nA druhý:\r\n- A ja som na ženy.', 135, 2.94, 29),
	(6373, 'Prestal som piť, fajčiť, myslieť na ženy.\r\nNajhorších 15 minút môjho života.', 86, 3.2, 29),
	(6374, 'V rodine kynológa sa narodili trojčatá. V porodnici ich priniesli\r\nukázať šťastnému otcovi, ten ich chviíľ pozorne prezerá a potom hovorí:\r\n"Toho stredného nechajte."', 179, 3.13, 29),
	(6375, 'Muži nie sú zvrhlí. Muži len dobre platia.', 46, 2.88, 29),
	(6376, 'Mužov zaujíma iba jedlo, spánok, šport a sex. Ešte aj psy sú záhadnejší.', 81, 2.94, 29),
	(6377, 'Rozprávajú sa dvaj muži. Jeden hovorí druhému: \r\n- Musím dať ženu na liečenie, lebo sa rozpráva sama so sebou. \r\nDruhý na to: \r\n- Aj tá moja si myslí, že sa s ňou rozprávam.', 189, 2.93, 29),
	(6378, 'Stretnú sa dvaja dedkovia a jeden sa sťažuje:\r\n– Človeče, ja mám strašné problémy so spaním. Nie a nie zaspať.\r\nA druhý nato hovorí:\r\n– To musíš robiť ako ja. Ja počítam do troch a vždy zaspím.\r\n– Fakt len do troch?\r\n– No niekedy aj do pol štvrtej.', 277, 3.04, 29),
	(6379, 'Chlapík sedí na verejnom záchode s neuveriteľnou zápchou. Zrau len počuje dupot, prudké otvorenie dverí, zips, čľapot a povzdych:\r\n"Ach."\r\nTak len nesmelo cez zuby poznamená:\r\n"Má to niekdo štastie. Ja tu už sedím dve hodiny a nič."\r\nZ vedľajšej budky sa ozve:\r\n"Štastie? Najprv si nestihnem rozopnúť gate a potom mi ešte aj mobil\r\npadne do záchoda."', 373, 2.9, 29),
	(6380, 'Rozprávajú sa dvaja dedovia:\r\n- Ten môj vnuk je chudák.\r\n- Prečo?\r\n- Ja som Slovák, babka Rumunka, otec je Maďar a mamu sme vychovali v Rusku a on chudáčisko nevie rozprávať ani jedným jazykom.\r\n- A koľko má rokov?\r\n- Už mu budú 2 mesiace!', 255, 2.9, 29),
	(6381, 'Idú dvaja kovboji na koňoch. Zastanú pred krčmou a jeden hovorí druhému:\r\n- Ako si mi tie kone potom rozpoznáme?\r\n- Ja svojmu useknem chvost.\r\nIdú ďalej a jeden hovorí:\r\n- Ten tvoj kôň bez chvosta ide rýchlejšie. Useknem chvost aj mojmu.\r\nZastanú pred krčmou.\r\n- Ako si rozpoznáme kone?\r\n- Ja svojmu useknem aj nohu.\r\nCvalajú po púšti a jeden hovorí:\r\n- Ten tvoj kôň bez jednej nohy ide rýchlejšie. Useknem nohu aj môjmu.\r\nTakto to ide ďalej až kým sa kone iba kotúľajú. Dokotúľajú sa ku krčme a znova sa pýta jeden kovboj:\r\n- A ako si mi tie ko ne teraz rozpoznáme?\r\n- Ja mám nápad. Môj je biely a tvoj čierny.', 653, 3, 29),
	(6382, 'Víte co má muž v rozkroku po 50letech?\r\nPřece jednoho nezaměstaného a pytel vzpomínek.', 93, 3.06, 29),
	(6383, 'Čo mužovi nenarastie ani za sto rokov? \r\nŠkrupina na vajci.', 62, 3.26, 29),
	(6384, '"Šéfe, mohli by ste mi znížiť plat? Manželka hovorila, že keď nebudem mať vyšší plat, rozvedie sa so mnou. Tak ma napadlo, že by sme to mohli pomôcť."', 165, 2.98, 29),
	(6385, 'Arnold sa vezie v nabitej električke, sused sa ho pýta:\r\n"Prosím vás, budete vystupovať na nasledujúcej zastávke?"\r\n"Áno."\r\n"A ľudia pred vami?"\r\n"Aj oni."\r\n"Ale nevidno žiaden pohyb."\r\n"Asi sa ešte nedovtípili."', 224, 2.82, 29),
	(6386, 'Odchádza vlak. Na peróne jeden máva na rozlučku, druhý z okna mu máva tiež a kričí:\r\n"Ešte raz ti ďakujem za pohostinstvo! Bolo u teba výborne, dobré bývanie, dobrá strava, aj s tvojou ženou sa mi dobre súložilo!"\r\nKeď vlak opustil stanicu, chlap zavrel okno a posadil sa do kupé. Spolucestujúci sa na neho dosť divne pozerali, tak pre ospravedlnenie vysvetlil.\r\n"Viete, tá jeho žena až tak dobre nesúložila, ale nechcel som kaziť radosť dobrému človeku."', 486, 2.93, 29),
	(6387, 'Stretnú sa dvaja muži v obchodnom dome:\r\n- Počuj, stratila sa mi manželka.\r\n- Aj mne.\r\n- Ako vyzerala tá tvoja?\r\n- Blond vlasy, vysoká 180, prsia štvorky...\r\n- A tá tvoja?\r\n- Na tú sa teraz vyserieme, ideme hľadať tvoju!', 231, 3.11, 29),
	(6388, 'Doktor pacientovi:\r\n"Ste vážne chorý. Takže žiadne fajčenie, žiadna pijatika, žiadne ženské!"\r\n"Ale pán doktor, veď som chlap!"\r\n"Dobre. Holenie máte povolené."', 174, 2.92, 29),
	(6389, 'V krčme sa jeden zdôveruje druhému:\r\n"Človeče, včera som sa vrátil domov, pred dverami desiatky topánky, na vešiaku 49-tka kabát, hneď ma chytil taký nepríjemný pocit. Vrazím do kuchyne, otvorím chladničku a fakt! Všetko pivo vypité!"', 253, 3.33, 29),
	(6390, 'Manželka sa pýta muža:\r\n"Tak čo tá tvoja nová sekretárka?"\r\n"Dobre, práca jej ide od ruky."\r\n"A ako sa oblieka?"\r\n"Rýchlo."', 132, 2.94, 29),
	(6391, 'Kovboji krotili divé mustangy, jeden z nich bol zvlášť ohnivý, každého zhodil po pár sekundách. Až sa medzi divákmi objavil jeden starší pán, že by to tiež skúsil. A fakt: podarilo sa mu udržať celých 10 minút, potom kôň padol vyčerpaním. Pýtali sa ho, kde sa to naučil.\r\n"Už 20 rokov denne súložím so svojou manželkou-epileptičkou."', 366, 2.97, 29),
	(6392, '"Drahá, môžeš mi prezradiť recept na tento koláč?"\r\n"Na čo ti bude? Snáď nechceš oslňovať kamarátov svojim kuchárskym umením?"\r\n"Nie, ale urobíme spoločne revolúciu v cementárenskom priemysle."', 213, 2.61, 29),
	(6393, '"Moja žena chodí každý večer do krčmy."\r\n"A to jej dovolíš?"\r\n"Jasné. Vieš, ako by sa mi samému zle išlo domov?"', 124, 2.76, 29),
	(6394, '"Včera sa mi  snívalo o tvojej žene.\r\n"Hej? A čo hovorila?"\r\n"Nič."\r\n"Tak to nebola moja žena."', 101, 2.97, 29),
	(6395, '"Ta dnešná mládež! To je strašné, ako sa obliekajú, napríklad tam ten mladík."\r\n"Ten mladík, to je moja dcéra."\r\n"Oh, prepáčte! Nevedel som, že ste jej matka."\r\n"Ja som jej otec."', 193, 3.04, 29),
	(6396, 'Príde bača Ondro z Očovej do Los Angeles, vystúpi z lietadla, ubytuje sa v hoteli, oblečie si kroj a poď ho na prechádzku do mesta. Kuká na všetko jak puk, huba otvorená, a ľudia na neho zazerajú. To sa mu nepáči, že ho obzerajú jak opicu. Zrazu zbadá Travoltu a kričí :\r\n"Héj počkaj Travolta , prosím ťa nemôžeš pre mňa niečo urobiť? Ja som bača Ondro z Očovej, všetci tu na nňa čumákujú."\r\n"Ale neotravuj, nemám čas."\r\n"Nie počkaj, šak dám ti aj žinčicu, to si ešte nepil, ja som zo Slovenska bača Ondro z Očovej, pomôž mi."\r\nTravoltovi je sympatický, že je taký smelý, tak hovorí:\r\n"No dobre a čo by to malo byť?"\r\n"Vidíš tamten bar? O 23,00 by si tam mohol prísť, rozkopneš dvere, poobzeráš sa po prítomných, aby si ťa všimli, ja budem sedieť pri bare, a ty ukážeš na mňa prstom  a  zvoláš :\r\n\'Héj, nie si ty náhodou bača Ondro z Očovej  zo Slovenska?\'"\r\n"No dobre, urobím to pre teba , náhodou mám čas."\r\nPresne o 23,00 sa rozletia dvere v tom bare a vojde Travolta. Poobzerá sa po prítomných, ukáže prstom na baču Ondra z Očovej a zvolá:\r\n"Héj, nie si ty náhodou bača Ondro z Očovej  zo Slovenska?"\r\nBača sa pomaly otočí a hovorí:\r\n"Ale ideš mi do čerta sedlák?!"', 1269, 3.03, 29),
	(6397, 'Jeden rozpráva kamarátom v krčme:\r\n"Chlapi, predstavte si. Prídem včera domov, zo spálne počujem vzdychanie, žena sa tam milovala s nejakým cudzím chlapom. Tak som vošiel do kuchyne, vybral z chladničky fľašu vodky, pomaly som ju vypil, pospieval pri tom smutné piesne. No a keď som sa lepšie poobzeral, zistil som, že som vošiel do cudzieho bytu!"', 367, 3.15, 29),
	(6398, 'Malý chlapček príde za jedným mládencom:\r\n"Ja so vás videl! Všetko som videl, ako si objímal aj bozkával moju sestru!"\r\n"Na, tu máš 10 korún, len to nikomu nepovedz!"\r\n"Počkaj, 5 korún ti ešte vrátim nazad, nie som zlodej, od každého beriem rovnako."', 268, 3.59, 29),
	(6399, 'Kovboj vyjde zo saloonu a predtým než nasadne na koňa, pristúpi k nemu zozadu, zdvihne chvost a pobozká ho priamo na ritný otvor. Ostatní kovboji čumia:\r\n"Čo to robíš?"\r\n"Aaale, mám popraskané pery."\r\n"A to pomáha?"\r\n"Nie, že by to priamo liečilo, ale aspoň si ich menej oblizujem."', 299, 3.21, 29),
	(6400, 'Dvaja na pustom ostrove:\r\n"Chcelo by to ženskú!"\r\n"A poriadne rozpálenú."\r\n"A s pekne chrumkavou kôročkou."', 113, 3.37, 29),
	(6401, 'Príde chlap do kostola, vrhne sa na kolená pod krížom s Ježišom Kristom a hovorí:\r\n"Ježiši Kriste, povedz mi prečo každý hovorí že som taký debil?"\r\n"Daj ma dole z kríža, poviem ti!"\r\nTak chlap naradostený vytrhne jeden klinčisko, druhý klinčisko.\r\nA Kristus hovorí:\r\n"Najskôr nohy ty debil!"', 315, 3.27, 29),
	(6402, 'Vieš ako sa vyznáva láska na horniakoch?\r\nIde Jano dolu z grúňa a stretne Maru, ktorá sa mu veľmi páči, nuž sa jej prihovára:\r\n- Marúúúš, videla si tam to hovnisko pod tým grúňom? To je moje!', 209, 3.16, 29),
	(6403, 'Niekoľko mesiacov sa na mori plaví loď. Chlapík - námorník zašiel za kapitánom a pýta sa ho:\r\n- Pán kapitán, kde sa tu chodíte sexuálne uspokojovať?\r\n- No, vidíš ten sud a v ňom tú dieru? Vopchaj ho tam a uvidíš. \r\nNámorník tak spravil a hovorí kapitánovi:\r\n- Pán kapitán, bolo to vynikajúce!!! A to tak môžem každý deň?\r\n- Áno, každý deň okrem stredy, hovorí kapitán.\r\n- No a vstredu prečo nie?\r\n- Lebo v stredu v tom sude máš službu ty.', 480, 3.5, 29),
	(6404, 'Dvaja chlapi v krčme sa rozprávajú. Jeden sa zrazu opýta.\r\n- Jožo, a koľko ty máš detí? \r\n- Asi sedem alebo osem.\r\n- Ty nevieš, koľko máš detí?\r\n- Ja sa zásadne do manželkiných vecí nestarám.', 210, 2.97, 29),
	(6405, 'Stretnú sa dvaja:\r\n"Nemal si ty aj ženu?"\r\n"Mal. Ale sa mi zunovala, tak som ju zabil."\r\n"Fakt?"\r\n"Fakt. Zakopal som ju na dvore. Keď neveríš, poď sa pozrieť."\r\nVyšli na dvor, tam v jednom mieste čerstvo rozkopaná zem, uprostred trčí holý zadok.\r\n"A ten si jej prečo nezakopal?"\r\n"Dobre sa tam parkuje bicykel."', 325, 3.05, 29),
	(6406, '- Musím sa ti priznať. Spal som s tvojou ženou.\r\n- Ajajaj, ty sa máš! Ja som s tou tvojou celú noc ani oka nezažmúril.', 126, 2.96, 29),
	(6407, 'Prídem domov a čo nevidím? Štyria bijú jedného. A viete ako to skončilo? Tak sme toho jedného nabili ako koňa.', 119, 2.94, 29),
	(6408, '"Otec, snívalo sa mi, že si mi dal sto korún!"\r\n"Môžeš si ich nechať, synku."', 84, 3, 29),
	(6409, 'Hovorí kamarát kamarátovi:\r\n- Predstav si!  Môj kamarát Jožo utiekol s mojou ženou.\r\n- Ale veď to nebol tvoj kamarát.\r\n- No odteraz ním je.', 149, 2.86, 29),
	(6410, 'Prečo si muži v zime obliekajú oteplovačky a na hlavách nenosia čiapky? \r\nLebo si udržujú mozog v teple.', 112, 2.7, 29),
	(6411, 'Stretnú sa dvaja.\r\n- Vraj si sa nedávno oženil.\r\n- Áno, pred troma mesiacmi.\r\n- A čo, aká je tá tvoja žena, pekná?\r\n- Nuž vieš, to je vec vkusu. Mne sa napríklad nepáči.', 183, 3.08, 29),
	(6412, 'Pred odchodom na oslavu k susedom:\r\n"Zlato, ktorú košeľu si mám dať? Tú s dvoma odtrhnutými gombíkmi, alebo radšej tú so špinavým golierom?"', 152, 2.72, 29),
	(6413, 'Viete, čo sa ťažšie stavia? Snehuliak alebo snehuliačka?\r\nSnehuliak, lebo jemu ešte treba vydlabať hlavu!', 112, 2.77, 29),
	(6414, 'Muži na Sahare:\r\n- Človeče, tu musela byť poľadovica, keď to tak posypali pieskom!', 88, 2.85, 29),
	(6415, 'Muži majú najmenšiu záhradku na svete. Jednu mrkvu, dva zemiačky a trošku petržlena!', 91, 1.56, 29),
	(6416, 'Sedí bača na vŕšku a pozoruje stopárku. Stopárke zastane auto, ona sa nakloní vodičovi do okna, on ju doň privrzne a znásilní.\r\nBača sa na to všetko pozerá a zamyslí sa:\r\n"Tak na to auto nemám, ale tie dvere...to si kúpim!"', 240, 3.1, 29),
	(6417, 'Letí dedko v lietadle a urobí sa mu nejak nevoľno. Tak mu ochotna letuška donesie igelitové vrecko, aby si uľavil. Po chvíli sa letuška vráti a vidí celé lietadlo ozvracane. Pýta sa dedka, ktorý sa usmieva:\r\n"Čo sa tu stalo?"\r\n"Ale, kým som na vás čakal, usadila sa mi na vrchu taká slivovička a tak som ju vypil."', 333, 2.78, 29),
	(6418, 'Pýta sa horolezec horolezca:\r\n- Prečo si dnes išiel na 4.poschodie výťahom?', 80, 2.98, 29),
	(6419, 'Rozprávajú sa dvaja východniari:\r\n- Vieš, tým v Bratislave sa žije. Pôjdu si do hotela, dajú im obed aj večeru zadarmo, v noci\r\nsa v hoteli zabavia, pomilujú a ráno keď odchádzajú z hotela, dajú im pred odchodom raňajky a vreckové.\r\n- Vážne? A ty si tam bol?\r\n- Ja nie, ale moja žena áno.\n', 310, 2.93, 29),
	(6420, 'Viete, aké sú obdobia muža?\r\nKeď verí na Mikuláša,\r\nkeď neverí na Mikuláša,\r\nkeď sa hrá na Mikuláša \r\na keď vyzerá ako Mikuláš.', 146, 3.03, 29),
	(6421, 'Prečo si muži vyberajú hlavne pekné sexy ženy?\r\nLebo u muža je ďaleko rozvinutejšie oko než mozog.', 107, 2.86, 29),
	(6422, '- Pán doktor, mám červené oko.\r\n- Aha, a milovali ste sa dnes?\r\n- Áno.\r\n- A včera?\r\n- Áno.\r\n- A minuly týždeň?\r\n- Každučký deň.\r\n- Tak to máte len nedostatok šťavy a svieti vám kontrolka.', 205, 3.02, 29),
	(6423, 'Traja kovboji súťažia kto je presnejší v streľbe.\r\nPrvý zatočil pištoľami a odstrelil koňa.\r\n"I\'m Jimmy!"\r\nDruhý vyhodil pištole a odstrelil dve muchy.\r\n"I\'m Henry!"\r\nTretí vyhodil pištole, zatočil s nimi a odstrelil obidvoch kovbojov.\r\n"I\'m sorry!"', 265, 3.11, 29),
	(6424, 'Traja muži sa rozprávajú o tom, že ktorá z ich žien je menšia:\r\n"Moja žena je taká malá, že keď ma rozhnevá tak ju zavriem do krabice a je ticho."\r\n"Moja žena je taká malá, že keď s ňou mám problémy, tak ju strčím do pivovej flaše a je kľud."\r\n"Pche, moja žena je tak malá, že keď má krámy tak ju strčím do fixky a týždeň s ňou píšem."', 374, 2.93, 29),
	(6425, '- No a potom sa loď potopila a ja som sa ocitol na pustom ostrove spolu s päťdesiatimi babami - rozpráva chlapík v spoločnosti. \r\nV miestnosti to len tak zašumí.\r\n- Lenže polovica z tých ženských mala AIDS a druhá polovica TBC - pokračuje chlapík. \r\nVšetci pokyvujú hlavou, že to je teda sakra zlá situácia. Lord Ramsey sa pýta:\r\n- A ako ste riešili takú zložitú situáciu?\r\n- No, počkal som si, ktorá zakašle a šup na ňu!', 452, 3.02, 29),
	(6426, 'Troch kamarátov na výlete zastihne strašná búrka, tak sa rozhodnú prenocovať na sene v opustenej stodole. Ráno sa zobudia a začínajú sa chváliť, komu sa čo snívalo. Prvý hovorí:\r\n- Teda chlapi, za mnou prišla v noci Schifferová, pomaličky sa vyzliekla a vrhla sa na mňa. A potom znovu a znovu!\r\nDruhý hovorí:\r\n- To nič nie je. Za mnou prišla v noci kompletná skupina Spice Girls a kým som ich všetky neobslúžil, nedali mi pokoj!\r\nLen ten tretí, ten čo spal v strede je akýsi zachmúrený. Tak sa ho ti dvaja pýtali, čo sa snívalo jemu?\r\n- Ále, zatiaľ čo vy ste si užívali s babami, ja som bol uprostred oceána v takej malilinkej lodičke a celú noc som vesloval a vesloval. A najhoršie bolo, že tie veslá mali také krátke rúčky.', 778, 3.17, 29),
	(6427, 'Povída Moravák druhému:\r\n"Tak to nebude zas moc zlý, na Slovensko se dostanete od Nového roku s občankou."\r\n"Tak to se nedostanu nikam."\r\n"???"\r\n"Patnáct let vdovec, já si nebudu kvúli vejletu shánět babu!"', 217, 2.92, 29),
	(6428, 'Sedí chlapík veľmi zamyslene v reštaurácii. Príde k nemu čašník a pýta sa: \r\n- Prosím vás, nad čím toľko premýšľate?\r\n- Ale, dodnes som si myslel, že ho mám na čúranie a jedna baba mi včera povedala, aby som sa s ním šiel vysrať!', 255, 2.64, 29),
	(6429, 'Jožo v práci prvý deň vyberie z tašky desiatu, rozbalí, pozrie a povie: \r\n- Chlieb z maslom.\r\nA odhodí desiatu do koša. Druhý deň opäť vyberie desiatu, pozrie a povie: \r\n- Opäť chlieb s maslom.\r\nA odhodí ju do koša. Tretí deň sa opakuje to isté a na štvrtý deň vyberie desiatu, ani sa neporzie čo tam má a zahodí ju do koša. Kolegovia sa ho pýtajú: \r\n- To sa ani nepozrieš, čo dnes máš?\r\nA Jožo na to: \r\n- A na čo, veď si ju pripravujem sám!', 477, 3.12, 29),
	(6430, 'Stretnú sa dvaja:\r\n"Pätnásť rokov Vás poznam a celý čas si kladiem stále tú istú otázku".\r\n"Akú?"\r\n"Kto nosí Vaše košele, keď sú čisté?"', 155, 3.33, 29),
	(6431, 'Definícia gynekológa: \r\nGynekológ je inteligent, ktorý hľadá problémy tam, kde my, normálni muži, hľadáme potešenie.', 128, 3.16, 29),
	(6432, 'Keď si Ralph všimol, že jeho penis začal rásť a rásť a stál mu dlhšie ako obyčajne, bol veľmi nadšený a taktiež aj jeho žena. Po niekoľkých týždňoch však už meral okolo pol metra a Ralph si začal robiť starosti. Problémy s chodením a tak... Nakoniec ho žena presvedčila, že musia za urológom.\r\n- No, to je vážne problém - hovorí doktor po vyšetrení. - Vyžaduje si to náročnú operáciu.\r\n- A ako dlho po nej bude musieť chodiť s barlami, pán doktor? - pýta sa žena\r\n- Prečo barly? Aké barly?\r\n- No, však mu chcete predĺžiť nohy, či nie?', 588, 3.31, 29),
	(6433, 'Dvaja dôchodcovia na lavičke.\r\n- Tak čo, ideme ku ženám?\r\n- Nemám záujem!\r\n- Ako to? Prečo?\r\n- No keď sme to robili naposledy, na dverách bolo napísamé Ženy a vnútri len samé záchodové misy...', 209, 2.96, 29),
	(6434, 'Bačovi Ondrovi k storočnici prišla gratulovať delegácia. Pri vchode do koliby vidia visieť kosu.\r\n- Vy ešte aj kosíte, bača Ondro?\r\n- Kdežeby...\r\n- No a tá kosa?\r\n- Jaaj, no to si už zubatá po mňa takto raz prišla. Slovo dalo slovo a tak som vám ju pretiahol, že si aj nástroj zabudla.', 303, 3.08, 29),
	(6435, 'Tlačenica v metre a žena sa nechtiac dotkla jedného muža na citlivom mieste.\r\n- Prepáčte, nechcela som.\r\n- Slečna, ja som šachista. Chcela - nechcela, keď ste sa raz figúrky dotkla, musíte s ňou hrať!', 213, 2.75, 29),
	(6436, 'Stretnú sa dvaja kamaráti:\r\n- Človeče, ja už doma so ženou nevládzem. Stále ma naháňa do postele a ja už ledva stojím na nohách.\r\n- Ja som ti to na svadbe hovoril, aby si si ju nebral! Hovoril som ti, neber si škratu, lebu budeš na to sám!', 255, 3.04, 29),
	(6437, 'Dvaja kamaráti sa rozprávajú pri pive:\r\n- Ja som si za tisíc dolárov prenajal chlapíka, ktorý si robí starosti za mňa.\r\n- Hej? A kde na to zoberieš peniaze?\r\n- To je jeho problém!', 190, 3.28, 29),
	(6438, '- Pišta, ako žiješ?\r\n- Ako melón!\r\n- ???\r\n- Brucho rastie, chvostík vysychá!', 82, 3.87, 29),
	(6439, 'Muž v noci vstane, ide na malú potrebu a hovorí:\r\n- Vidíš, keď ty potrebuješ, ja vždy vstanem.', 102, 3.52, 29),
	(6440, 'Clapík príde do krčmy s havranom na pleci.\r\n"Mne 10 a havranovi 11."\r\nVypije on, vypije havran.\r\n"Kde ste zohnali toho vtáka?", spýtal sa barman.\r\n"No...",pustil sa do vysvetlovania chlapík.\r\n"Chytil som zlatú rybku a prial som si krásny dom, super zenu a vtáka čo veľa vydrží."', 291, 3.34, 29),
	(6441, 'Príde muž do hotela a pýta sa recepčného:\r\n- Prosím vás máte voľnú izbu?\r\n- Mám, a vy máte rezerváciu?\r\n- A čo vyzerám ako indián?', 146, 3.27, 29),
	(6442, 'Sused vraví susedovi: \r\n- Konečne mi zlodeji prestali kradnúť stierače!\r\n- Ako to?\r\n- Namontoval som ich znútra.', 118, 2.86, 29),
	(6443, 'V koncentráku, v plynovej komore okrem iných je aj jeden vychodniar.\r\nZrazu počuť strašný rachot. Strážca pri dverach plynovej komory reve: \r\n- Čo je to tam za rámus?\r\nA vychodniar:\r\n- Dušim še, ne?', 210, 3.03, 29),
	(6444, 'Stretnú sa dvaja kamaráti po dlhšej dobe a navzájom vyzvedajú, čo kto robí. Ten jeden hovorí:\r\n- Ale, pracujem vo fabrike na páse.\r\nTen druhý:\r\n- No, to nie je bohviečo. Ja chodím v nedeľu na futbal. Tam cez polčas idem ku plotu, kde sa chlapi idú vyčúrať, chytím im vtáka z druhej strany plotu, nôž v ruke a spýtam sa: "Dáš stovku alebo vtáka?" No a všetci dajú po stovke.\r\nTen prvý odpovedá: \r\n- To je výborné, to skúsim v nedeľu aj ja.\r\nPo nedeľnajšom zápase sa stretnú a navzájom hodnotia výsledky. Skúsený hovorí: \r\n- Ja mám 800 SK a ty?\r\nZačiatočník odpovedá:\r\n- Ja mám 500 SK a 4 vtákov.', 644, 3.28, 29),
	(6445, 'Stojí bača opretý o saláš a hrozne vracia.\r\nIde okolo kamarát:\r\n"Ďuro a čo si bol opitý?"\r\n"Ále nie!" - odpovedá bača - "zjedol som štyri halušky, myslím si, neoplatí sa zadok špiniť!!!"', 204, 3.32, 29),
	(6446, 'Čo je pre muža najväčší smútok?\r\nKeď sa rozbehne s postaveným penisom oproti stene a rozbije si nos.', 109, 2.92, 29),
	(6447, 'Aký je rozdiel medzi chlapom a mliečnym zubom?\r\nMliečny zub vie, kedy má vypadnúť.', 88, 3.29, 29),
	(6448, 'Stretnú sa dvaja kamaráti a jeden sa sťažuje druhému.\r\n- Počúvaj, v tomto meste všetci klamú. Len ti tak idem po stanici a vidím na dverách nápis ŽENY. Vojdem dnu a tam iba záchod.', 194, 3.13, 29),
	(6449, 'Na ulici stretne lekár manžela svojej pacientky.\r\n- Nerád, ale musím vám povedať, že vaša manželka sa mi vôbec nepáči.\r\n- Kvôli tomu sa netrápte, pán doktor. Ja som si zvykol, ale vaša tiež krásou veľmi nevyniká.', 232, 3.17, 29),
	(6450, 'Jano sa sťažuje Jožovi v krčme:\r\n- To je už so mnou strašné, vládzem len raz týždenne pomilovať manželku.\r\nJožo na to:\r\n- Oj, ja ju ešte týždenne zo desaťkrát pomilujem.\r\n- Ale nevrav, však ty nijakú manželku nemáš.\r\n- No hej, ale my sa bavíme o tvojej, či nie?', 286, 3.19, 29),
	(6451, 'Príde chlapík do cukrárne a objedná si 40 krémešov. Zaplatí, potom ich hodí na dlážku a divoko po nich poskáče. Šokovaná predavačka sa nemôže ani na slovo. Na druhý deň to isté. 40 krémešov skončia na dlážke rozdupané. Na tretí deň detto. To už predavačka nevydrží:\r\n- Nehnevajte sa, nie ste vy náhodou železničiar?\r\n- No toto? Ako ste to uhádli?\r\n- Podľa uniformy...', 404, 2.83, 29),
	(6452, 'Bavia sa dvaja zakomplexovaní introverti:\r\n- Čo sa ti viac páči? Sex alebo novoročné oslavy?\r\n- Nový rok. Ten býva predsa častejšie.', 142, 2.96, 29),
	(6453, 'Idú nekrofil a pedofil po ulici a vidia malé dievčatko. \r\nPedofil sa pýta:\r\n- Tak čo spravíme ju?\r\nNekrofil: \r\n- Čím tehlou?', 132, 3.18, 29),
	(6454, 'Rozprávajú sa dvaja muži:\r\n- Ty, počúvaj a o čom sa rozprávajú ženy medzi sebou?\r\n- No, o tom o čom my.\r\n- Svine.', 123, 3.21, 29),
	(6455, 'Rozprávajú sa dve ženy v obchode s potravinami na predmestí Washingtonu. \r\n- Ty Kate, včera na CNN povedali že tým sniperom je stará prostitútka, ktorá trestá všetkých klientov, ktorý ju pretiahli a nezaplatili. \r\nKate sa rozbehne k východu a Rosie udivene hľadí čo sa stalo. \r\n- To vysvetľuje, prečo ten môj hajzel odvčera už ani smeti nevynesie.', 370, 3.28, 29),
	(6456, 'Mujo si kúpil mačku. O niekoľko dní ho stretne Haso a pýta sa ho, prečo je taký smutný. \r\n- Zdochla mi mačka...\r\n- Ako ti zdochla, kedy?\r\n- Keď som ju kúpal.\r\n- Mujo ty si ju utopil...\r\n- Nezdochla mi pri kúpaní!\r\n- A ako potom umrela?\r\n- Keď som ju žmýkal...', 275, 3.27, 29),
	(6457, 'Prečo sa muž do päťdesiatke vždy spotí medzi dvoma číslami?\r\nLebo je medzi nimi leto. ', 94, 2.85, 29),
	(6458, 'Čo je to vrchol impotencie?\r\nKeď aj parohy visia.', 51, 3.03, 29),
	(6459, 'Muž hovorí kamarátovi:\r\n- Ty, počúvaj, to že som spal s tvojou ženou, tak to sme ako švagrovia, nie?\r\n- To nie, teraz sme vyrovnaní.', 141, 2.91, 29),
	(6460, 'Kedy je muž v prechode? \r\nKeď mu smrdí žena a vonia robota!', 63, 3.13, 29),
	(6461, 'Muž si uväzuje kravatu pred zrkadlom a hovorí svojmu pipíkovi:\r\n"Keď si kúpim nové ponožky to sa pozeráš, ale keď mám novú kravatu to sa ani len nehneš..."', 169, 3.19, 29),
	(6462, 'Stretnú sa dvaja kamaráti:\r\n- Včera mi vyšiel prvý článok.\r\n- Ty píšeš do novín?\r\n- Nie, mám pásomnicu.', 116, 3.13, 29),
	(6463, 'Viete, čo je mužský ideál?\r\nPanna so skúsenosťami.', 56, 2.84, 29),
	(6464, 'Prečo chlapi prdia viac ako ženy?\r\n- Lebo ženy nedokážu držať klapačku dosť dlho na to, aby vytvorili v tele nejaky podtlak.', 133, 3.62, 29),
	(6465, 'Matka telefonuje učiteľke:\r\n- Prosím vás, nedávajte deťom úlohy z matematiky, v ktorých fľaša piva stojí päť korún. Môj muž nemohol od vzrušenia večer zaspať!', 177, 3.36, 29),
	(6466, 'Dvaja opitý pri cikaní z mosta:\r\n-Jéj,ako pekne ti to strieka...\r\n-Aj tebe by, keby si si rozopol nohavice...', 112, 3.69, 29),
	(6467, 'Človeče, preboha, kto ti urobil ten hrozný monokel pod okom??"\r\nAle, pobil som sa kvôli frajerke."\r\nHej? A s kým?"\r\nS mojou manželkou."', 141, 3.48, 29),
	(6468, 'Príde k doktorovi istý pán s veľkým problémom.\r\n"Pán doktor,mám problém s tým dole, no veď viete..."\r\n"Áno samozrejme, tak sa vyzlečte a ja sa na to pozriem."\r\nChlapík sa vyzlečie a doktor tam vidí jednocentimetrové nič.\r\n"Tak to máme veľký problém",hovorí doktor.\r\n"No vidíte ja som vám vravel a predstavte si , že takto to mám napuchnuté už týždeň!"', 383, 3.33, 29),
	(6469, 'Sedí muž v bare a vedľa si prisadne muž s krabicou, v ktorej dve malé postavičky hrajú tenis. Muž sa ho pýta. \r\n"Odkiaľ máte taký tenis?" \r\n"Mám doma zázračného džina, ktorý mi splní každé želanie." \r\n"A nemohli by ste mi ho na jedno želanie požičať?" \r\n"Ale áno samozrejme." \r\nMuž príde domov s džinom, ktorý už vyliezol z flašky. Muž mu hovorí. \r\n"Chcem milión amerických doláčikov!" \r\nZrazu je izba plná amerických koláčikov. Na druhý deň príde muž nazlostený do baru a hovorí tomu druhému. \r\n"To si mi nemohol povedať, že ten džin je nahluchlý?" \r\n"Ja som tiež nechcel 30-centimetrový tenis!"\r\n', 654, 4.24, 29),
	(6470, 'Z dielne: \r\n- Daj mi francuzák.\r\n.....\r\n- Fuuuj - kľúč, ty magor!\r\n\n', 72, 3.91, 29),
	(6471, 'Stretne sa fajčiar, alkoholik a buzerant v nemocnici. Doktor vraví alkoholikovi že keď si dá ešte jeden pol decák, tak umrie. Potom doktor vraví  fajčiarovi, že keď si dá ešte jedného šluka tak, umrie a nakoniec buzerantovi, ktorému vraví, že keď si ešte raz pichne, tak umrie. Vyjde alkoholik von z nemocnice, zbadá krčmu, ihneď si dá jeden pol decák a umrie. Vyjde z nemocnice fajčiar, zbadá zahodenú cigaretu a buzerant mu hovorí: "Zohni sa a umrieme obaja. ', 490, 3.61, 29),
	(6472, 'Príde koktavý do krčmy a hovorí: "Ven,ven,ven.." Všetci vyšli von a koktavý dokončí slovo: "Vendelín tu nebol?"', 121, 4, 29),
	(6473, 'Chlapík stretne kamaráta a hovorí mu:\r\n- Nazdar Fero, vieš čo? Mám v aute dve ženy, no a keď si trochu vypiješ tak sa na nich dá aj pozerať.\r\nFero podíde k autu, otvorí dvere, pozrie sa, otočí sa a povie:\r\n- Vieš čo nie, ja tak veľa vypiť nedokážem. ', 271, 3.76, 29),
	(6474, 'Muž ide kupovať žene podprsenku, ale nevie akú. Predavačka mu radí:\r\n- Skúste to napríklad k niečomu prirovnať. Čo ja viem..., napríklad k citrónom, k pomarančom alebo dokonca k melónom.\r\nMuž chvíľu rozmýšľa a po chvíli povie:\r\n- Viete aké uši má kokeršpaniel?', 286, 3.33, 29),
	(6475, '...Vieš, čo o mne rozširuje Kata? Že ju ignorujem. A ja si ju pritom vôbec nevšímam."', 92, 2.94, 29),
	(6476, '- Aký je rozdiel medzi mužom a prácou? Práca sa sama nespraví.', 67, 3.91, 29),
	(6477, 'Charakteristika muža po päťdesiatke:\r\n1. Na prsiach mu chrčí\r\n2. Na ženu vrčí\r\n3. A keď ho tam strčí, tak sa mu skrčí', 130, 3.84, 29),
	(6478, 'Príde Dežo k doktorovi a vraví: "Pán doktor, ja mám taký problém, s manželkou musíme mať každý deň sex a máme už 24 detí. Pán doktor, prosím vás, odrežte mi ho! A doktor na to: "Dežko, ale to nevydržíš, nechceš si to premyslieť?""Nie, odrežte mi ho!"Tak mu ho doktor odrezal. Po dvoch dňoch príde Dežo zase a hovorí: "Pán doktor, ja to nevydržím, prišite mi ho! Doktor: "No ale, ja už mám len takého z opice!"\r\nDežo: "Nevadí, ja to nevydržím!"A doktor mu ho teda prišije. Dežo sa už viac nesťažoval a za doktorom viac neprišiel. Raz ho doktor stretne na ulici a pýta sa ho: "No ako Dežko?""Dežo: "Dobre pán doktor, teraz už dobre. Všetko čo sa narodí beží hneď do lesa!"', 729, 3.33, 29),
	(6479, 'Čech, Rus a Slovák súťažia kto najdlhšie vydrží pod vodou. Ide Čech a nevydrží. Ide Rus a tiež nevydrží. A ide Slovák a vydrží tam až 100 rokov. Potom sa pýtajú jeho kostry, ako to že tam vydržal tak dlho."Dal som si erveis mint fres." ', 258, 3.47, 29),
	(6480, 'Dedkovi sa stratila koza, ide parkom, kde dvaja zaľúbenci sedia na lavičke. Muž vraví žene: "V tvojich očiach vidím celý svet..."A dedko sa pýta: "A moju kozu ste tam nevideli?"', 187, 4.04, 29),
	(6481, 'Nadpis nad pisoárom:\r\n"Nerob frajera a pristúp bližšie!"', 60, 4.04, 29),
	(6482, '- Aký je rozdiel medzi mužom a šampónom?Žiadny, obaja sú na hlavu.', 72, 2.69, 29),
	(6483, 'Malý Janko hovorí ockovi: "Oci, predajme mamu."\r\nOtec na to: "Čo ti šibe a čo budeme mať?"\r\nA malý Janko: "No ale mňa už nekojí, tebe nestojí, tak načo ju budeme nadarmo chovať."', 191, 3.53, 29),
	(6484, '- Viete čo sa stane keď vymrú všetci muži?\r\n- Ženy si skrotia iný druh dobytka.', 86, 2.58, 29),
	(6485, '- Viete kedy treba požiadať ženu o ruku?\r\n- Keď už nevládze ústami.', 74, 3.95, 29),
	(6486, 'Príde manželka domov a vidí ako si manžel dáva obložený rožok do zadku. Manželka sa ho pýta: "Prečo si ten rožok dávaš do zadku?"\r\nA manžel jej odpovedá: "Zubár mi povedal, aby som jedol druhou stranou!"', 220, 3.32, 29),
	(6487, '1.Než sa jedlo dostane z úst do žalúdka, trvá to 7 sekúnd.2. Ľudský vlas udrží 3 kg.3. Penis má rovnakú dĺžku v cm ako palec majiteľa x 3.4. Ženské srdce bije rýchlejšie než mužské.5. Na jednom chodidle máme viac než tisíc miliárd baktérií.6. Používame 300 svalov len na udržanie rovnováhy.7. Stehenná kosť je tvrdá ako cement.... Každá žena už toto dočítala. Muži si ešte stále prezerajú svoj palec...', 447, 4.27, 29),
	(6488, 'Chlapík drhne mydlom rifle a hundre: Nikomu sa nedá veriť, nikomu, ... dokonca ani sebe..... a hundre si ďalej: A to som si chcel len prdnúť!', 147, 4.04, 29),
	(6489, 'Rozdiel medzi reakciami muža a ženy pri porezaní prsta:\r\nŽENA - pomyslí si "au", a strčí prst do pusy, aby krv nekvapkala po koberci, druhou rukou si zalepí ranu a pokračuje v práci.\r\nMUŽ - zareve "do frasa" a...\r\n- Natiahne ruku čo najďalej od seba.\r\n- Díva sa iným smerom, pretože neznáša pohľad na krv.\r\n- Volá o pomoc.\r\n...- S vytreštenými očami čumí na fľak, ktorý sa robí na koberci.\r\n- Musí sa posadiť, pretože mu začína byť divne.\r\n- Na pomoc prichádzajúcej žene dramaticky vysvetľuje, že si práve takmer amputoval ruku.\r\n- Odstrčí ponúkanú náplasť, pretože sa mu zdá malá na to jeho obrovské zranenie.\r\n- Tajne nalistuje v "domácej zdravovede" stránku o tom, akú stratu krvi môže človek prežiť, zatiaľ čo žena uteká do lekárne pre väčšie náplasti.\r\n- Chce k večeri veľký steak, aby obnovil tvorbu krvných buniek.\r\n- Vyžaduje nutne pár pív proti stresu a bolesti.\r\n- Odlepí náplasť, aby sa pozrel, či rana ešte krváca, zatiaľ čo vy idete do obchodu pre pivo.\r\n- Tak dlho stláča ranu, až z nej opäť začne tiecť krv.\r\n- Vyčíta vám, že ste náplasť nenalepila pevne.\r\n- Fňuká, keď mu odstraňujete starú náplasť a lepíte novú.\r\n- Kvôli svojmu zraneniu nemôže ísť s vami večer do kina.\r\n- Miesto toho sa utešuje Európskym pohárom, ktorý náhodou beží v televízii.\r\n- Vy sa zatiaľ snažíte vyčistiť fľak z koberca.\r\n- V noci často rozsvecuje, aby sa presvedčil, že mu nenaskakujú podozrivé škvrny, ktoré svedčia o otrave krvi.\r\n- Druhý deň je strašne ospalý a podráždený.\r\n- Vezme si doobeda 2 hodiny voľno, aby navštívil lekára, ktorý vylúči otravu krvi.\r\n- Poobede si pre istotu dá ruku previazať blonďavej sekretárke a užíva si jej súcit.\r\n- S obrovským obväzom ide večer do krčmy a frajersky hovorí, že tá "maličkosť" naozaj nestojí za reč!\r\n', 1909, 4.19, 29),
	(6490, 'Syn ukazuje otcovi vysvedčenie.\r\nOtec sa naň pozerá a hneď ho napadne, že so synom hodí menšiu reč. \r\nZačína krátkymi otázkami:\r\nOTEC: Synček dáš si cigaretu?\r\nSYN: Pravdaže oci! \r\nOTEC: Dáš si pálenku?\r\nSYN: Jasné oci!\r\nOtec po krátkom rozmýšľaní vyberie zo skrinky PLAYBOY, ukazuje ho synovi a hovorí: \r\nSynček, dáš si tieto baby, však sú sexi?\r\nSYN: Jasné oci!\r\nOTEC: A vieš ty kto tieto dievčatá "kefuje?" \r\nSYN: Nie, neviem ...\r\nOTEC: No predsa jednotkári!!', 498, 3.86, 29),
	(6491, 'Do šatne hokejového mužstva vstúpi tréner a hovorí:\rChlapi už som prišiel na to, čo urobíme, aby sme vyhrávali.\rČo tréner?\rSpravím z vás dychovku!', 161, 3.19, 29),
	(6492, 'Záhorák hovorí svojej žene: "Očúvaj stará, blížá sa Ti svátky, kupíme sviňu, zabijeme, budú jitrničky, klobáse, krvavnice."\r\nZrazu sa otočí, čapne synovi po papuli, až ten padne zo stoličky.\r\nŽena sa ho pýta: "Ná co robíš, šak ti nic nespraviu!"\r\n"Už ho vidzím debila, jak to žere bez chleba!"', 323, 4, 29),
	(6493, 'Pri horiacom dome hovorí muž známemu:\r- Cítim karamel.\r- Viem, môj dedo mal cukrovku.', 90, 3.82, 29),
	(6494, 'Muž ide domov a uvidí svoju priateľku ako si balí kufre:\r\n- Ty odchádzaš?\r\n- Áno, lebo som počula o tebe, že si pedofil.\r\n- Ááha... Veľmi veľké slová najmä z úst 10 ročného dievčatka!', 203, 4.1, 29),
	(6495, 'Na daňovom úrade sa stretnú dvaja podnikatela:\r\n- Jožo, preboha, prečo si taký smutný?\r\n- Aaale, dal som si veľmi dlhý názov firmy a nezmestí sa mi do kolóniek...\r\n- No a? Veď si daj skratku, nie?\r\n- Nemôžem, firma sa volá "Projektovanie, Inžinierska Činnosť, Analýzy", chápe š, čo by z toho vzniklo?', 323, 4.24, 29),
	(6496, 'Čo treba vinšovať mužovi k 60-ke ?\r\nDobré zdravie a pevný ritný sval.\r\nPrečo? \r\nNo keď sa mu postaví, aby sa od radosti neposral.', 139, 4.05, 29),
	(6497, 'Vo vode sa topí žena. Na brehu stojí hlúpy muž, múdry muž a vodník. Kto ju zachráni?\r\nHlúpy muž... \r\nLebo múdry muž a vodník sú rozprávkové bytosti...', 167, 3.91, 29),
	(6498, 'Všetky dievčatá hľadajú milého, pekného, galantného, upraveného chlapca...\r\nAle taký chlapec, už chlapca má.', 120, 4.29, 29),
	(6499, 'Chlapík v lekárni hovorí:\r\n- Prosím si 3 šprcky!\r\nA lekárnička:\r\n- Preboha to nemôžete trochu tichšie? Je tu dáma.\r\nChlapík sa otočí a povie:\r\n- Jééé, nazdar Božka... Tak si prosím ešte jeden.', 212, 4.19, 29),
	(6500, 'Pozostalí na pohrebe počúvajú farára, ktorý rozpráva o zosnulej žene:\r\nBola to starostlivá, usilovná mamička... Vtom sa otec mŕtvej ženy otočí a vraví deťom: \r\nPoďte ideme preč, asi sme si splietli pohreb.', 224, 4.03, 29),
	(6501, 'Blázon sa pozerá s baterkou pod posteľ a druhý sa ho pýta:\r\n- Čo robíš ?\r\n- Ale pozerám, či som dobre zhasol.', 119, 3.4, 30),
	(6502, '- Pán doktor, urobte niečo s mojou ženou - hovorí manžel psychiatrovi. Už to takto ďalej nemôže ísť! Tá bláznivá ženská chová v byte dvanásť mačiek! Viete si predstaviť ten smrad?\r\n- A prečo neotvoríte okná?\r\n- Čože? Aby mi vyletel môj kŕdeľ holubov?', 279, 3.59, 30),
	(6503, 'V blázinci:\r\n- Počujte, prečo vy všetkým hovoríte, že ste Napoleon Bonaparte a mne tvrdíte, že ste Ľudovít XVI?\r\n- Viete pán doktor, vás si predsa nedovolím klamať.', 179, 3.28, 30),
	(6504, 'Blázon naháňa psychiatra po blázinci so sekerou v ruke. Zrazu zaženie psychiatra do slepej uličky. Obaja sa pozerajú do očí, blázon sa pomaly približuje, doktor si už kľakne na kolená a čaká na smrť, keď v tom blázon skríkne:\r\n- Tu máš, teraz naháňaj ty mňa!', 283, 3.91, 30),
	(6505, 'Pacient hovorí psychiatrovi:\r\n- Pán doktor, ja mám radšej silónové ponožky ako bavlnené.\r\n- Aj ja mám radšej silónové - hovorí psychiater.\r\nA pacient nato:\r\n- A máte ich radšej s jahodovým džemom, alebo slivkovým ako ja?', 238, 3.43, 30),
	(6506, 'Blázon neustále niečo hľadá. Príde k nemu psychiater a pýta sa:\r\n- Čo to tu toľko hľadáš?\r\n- Hodinky.\r\n- A kde si ich stratil?\r\n- Vo svojej izbe.\r\n- No a prečo ich hľadáš tu?\r\n- Lebo tu je viac svetla.', 217, 3.22, 30),
	(6507, 'V blázinci:\r\n"Počujte, prečo vy všetkým hovoríte, že ste Napoleon Bonaparte a mne tvrdíte, že ste Ľudovít XVI?"\r\n"Viete pán doktor, vás si predsa nedovolím klamať."', 179, 3.02, 30),
	(6508, 'Psychiater vyšetruje pacienta a pýta sa ho:\r\n"Čo by sa stalo, keby som vám odrezal jedno ucho?"\r\n"Nepočul by som.""\r\nPsychiater si robí poznámky a pokračuje.\r\n"A čo by sa stalo keby som vám odrezal aj druhé ucho?"\r\n"Nevidel by som."\r\n"Ako to?", čuduje sa psychiater. \r\n"Spadli by mi okuliare."', 305, 4.04, 30),
	(6509, 'Chromý vraví slepému:\r\n- Ja ťa kopnem.\r\n- To chcem vidieť.', 63, 3.75, 30),
	(6510, 'Dvaja blázni sa z dvora blázinca pozerajú na dúhu a jeden hovorí:\r\n- Na reklamu peniaze majú, ale aby nás niečo naučili, tak to nie...', 143, 3.45, 30),
	(6511, 'V blazinci postavili bazén. Riaditeľ naženie bláznov na dvor a rečie:\r\n- Kedže ste boli dobrí, môžte sa vyblázniť v bazéne.\r\nBlázni šťastní šantia, skáču a riaditeľ na to:\r\n- No a keď budete ešte lepší, tak vám napustíme aj vodu.', 255, 3.18, 30),
	(6512, 'V domove pre postihnuté deti sa koná dobročinná zábava. Počas nej moderátor vyhlási súťaž o najlepší tanec. Víťazom sa stane Móricko. Moderátor si ho zavolá na pódium, gratuluje mu a hovorí:\r\n- Móricko, to bolo super, čo to bol vlastne za tanec?\r\nMóricko:\r\n- Ale ja som si len išiel pre čaj.', 316, 3.64, 30),
	(6513, 'Ide riaditeľ blázinca po chodbe a kričí: \r\n- Blázni utekajte, lebo vás všetkých zderivujem. \r\nVšetci začnú utekať, len jeden to má na brade. Riaditeľ sa ho pýta:\r\n- A ty prečo neutekáš?\r\n- Ja som é na x.', 222, 3.01, 30),
	(6514, 'Pacient príde za psychiatrom a ten sa ho pýta, čo sa mu stalo.\r\n- No viete, bol som u svojej milenky a keď sme boli v najlepšom, zrazu prišiel s veľkým buchotom jej manžel.\r\n- A vám z toho preskočilo.\r\n- Nie, ja som sa nemal kam schovať, tak som sa zavesil na okenný rám z vonkajšej strany. Ale on ma tam našiel.\r\n- A z toho ste sa zbláznili.\r\n- Nie, potom priniesol kladivo a do každého prsta mi dal poriadnu ranu.\r\n- Tak to chápem, z toho sa človek musí zblázniť.\r\n- To ešte nie, ale potom som sa pozrel pod seba a visel som nohami 10 centimetrov nad zemou. Z toho mi jeblo.', 601, 3.56, 30),
	(6515, 'Sedia dvaja blázni v izbe a jeden hovorí:\r\n- Som Mojžiš a Pán Boh mi dal desať božích prikázaní.\r\nDruhý na to: \r\n- Čo som ti to dal?', 144, 3.36, 30),
	(6516, 'Ide si tak dedko slovák - východniar po Václaváku a zastaví sa pri vysokom dome. Policajt sa ho pýta:\r\n- Dedku, co tady tak stojíte?\r\n- Ale, kukám aký veľký dom.\r\n- Víte dedku, to je cvokhaus pro Slováky.\r\n- No však kukám, že pre Čechov je dajaký malý...', 273, 3.37, 30),
	(6517, 'Blázni sa rozprávajú:\r\n- Pozri sa aký je tu múr. Ak je vysoký, podlezieme, ak nízky,  tak preskočíme.\r\nDruhý sa zadychčaný vráti:\r\n- Z úteku nebude nič, tu nie je nijaký múr.', 191, 3.57, 30),
	(6518, 'Príde retardovaný Janko ku kaderníkovi a hovorí:\r\n- Ujo, ostriháte ma?\r\n- Samozrejme. A aký účes by si chcel?\r\n- To je jedno. Hlavne, aby som nevypadal ako debil.', 170, 3.01, 30),
	(6519, 'Pacientka ústavu pre bláznov sa prišla sťažovať lekárovi.\r\n- Pán doktor, prosím vás, preložte ma na inú izbu.\r\n- A prečo?\r\n- Každú noc moja susedka strká svoje prsty do elektrickej zásuvky a kričí \'Som lampa, som lampa!\'. A pán doktor, vy viete, že keď svieti lampa ja nemôžem spať.', 307, 3.46, 30),
	(6520, 'Dvom Šmolkom a jednému bláznovi sa pokazí uprostred púšte auto. Prvý šmolko hovorí,keď sa vydajú hľadať pomoc:\r\n"Ja vezmem nejakú konzervu,keď budeme hladný,najeme sa. \r\n"Ja vezmem vodu,keď budeme smädný,napijeme sa."\r\nBlázon hovorí:"Ja vezmem dvere od auta,keď bude teplo,otvoríme okienko."', 314, 3.71, 30),
	(6521, 'Dvaja blázni sa stretnú pri partii \'človeče nezlob se\' a jeden hovorí:\r\n- Šach mat.\r\nA druhý na to:\r\n- Čo ti šibe? Veď nehráme basketbal.', 148, 3.35, 30),
	(6522, 'Kôli nedostatku priestorov v psychiatrickej liečebni sa psichiatri rozhodli prepústiť tých "normalnejšich". Tak sa išli pozrieť na záchod. Vojdu dnu a tam traja blázni chytajú ryby. A tak sa spýtajú prvého:\r\n- Berie?\r\n- Hej, hej, berie, paráda!\r\nSpýtajú sa druhého, ale odpovedal takisto. Keď sa spýtali tretieho, odpovedal, že nie. Tak ho prepustili. Pri východe z blázinca sa ho vrátnik pýta:\r\n- Prečo si povedal, že neberie?\r\nCvok sa mu zasmeje a povie:\r\n- Dobre miesta neprezrádzam.', 514, 4, 30),
	(6523, '- Pán doktor, stále po mne behajú biele myši!\r\n- A prečo ich po mne hádžete?', 83, 3.47, 30),
	(6524, 'Príde Mikuláš do domova prepostihnuté deti a hovorí im: \r\n"Milé detičky. Kto ujovi Mikulášovi pekne zaspieva, dostane od neho veľký darček." \r\nDetičky sa začnú tlačiť k Mikulášovi. Jedno sa postaví rovno pred Mikuláša a začne spievať:\r\n"HmEaaheeea." \r\nMikuláš celý nahnevaný vstane a hovorí: \r\n"A kto si z toho bude robiť srandu tak nič nedostane!"', 379, 3.37, 30),
	(6525, 'Na psychiatrické oddelenie príde na konrolu tím lekárov. Keď idú okolo pacientov vidia, že všetci visia na lustroch. Pýtajú sa strážnika: \r\n"Prečo všetci visia na lustoch?"\r\n"Viete oni si myslia, že sú listy stromov, ale keď príde jeseň oni spadnú."\r\nPrídu na jeseň a všetci už spadli, iba jeden ostal visieť.\r\n"Prečo ten jeden neopadol?"\r\n"Viete on je ihličnan."', 390, 3.8, 30),
	(6526, 'Traja blázni chcú újsť z blázninca cez kľúčovú dierku. Rozbehne sa prvý blázon. \r\nBUM. \r\nNarazí do dverí a neprejde. Rozbehne sa druhý blázon.\r\nBUM. \r\nNarazí do dverí a neprejde. Rozbehne sa tretí blázon, zastaví sa pri dverách, pozrie sa cez kľúčovú dierku a povie:\r\n- Vy somári, veď tam je kľúč.', 327, 3.57, 30),
	(6527, 'U psychiatra:\r\n- Odkedy si myslíte, že ste princ?\r\n- Odkedy nie som žaba.', 76, 3.46, 30),
	(6528, 'Blázon v blázninci chytá ryby v lavóry. Ide okolo vedúci a pýta sa ho:\r\n- No čo? Berú, berú?\r\nBlázon na to odpovedá:\r\n- Čo ti šibe, v lavóry?', 155, 3.34, 30),
	(6529, 'Blázni sa rozprávajú:\r\n- Pozri sa, aký je ten múr. Ak je vysoký, podlezieme ho a ak je nízky, tak ho preskočíme.\r\nDruhý sa zadýchaný vráti a vraví:\r\n- Z úteku nič nebude/ Žiadny múr tam nie je.', 211, 3.46, 30),
	(6530, 'Viete, aký je rozdiel medzi školou a blázincom?\r\nTaký, že v blázinci je aspoň personál normálny.', 105, 3.67, 30),
	(6531, 'Psychiater hovorí kolegovi:\r\n- Vieš, mám výborného pacienta. Trpí na rozdvojenie osobnosti. A platia obaja.', 113, 3.19, 30),
	(6532, 'Múdry vraví hlupému: \r\n- Ty, počuj, dám ti hádanku. Keď ju nebudeš vedieť dáš mi päť korún, potom ak ja neuhádnem tvoju, dám ti sto korún.\r\nHlúpy súhlasil. \r\nMúdry vraví:\r\n- Má to štyri nohy a sedí sa na tom, čo je to?\r\nHlúpy: \r\n- Čo ja viem, tu máš 5 korún.\r\nHlúpy dáva hádanku: \r\n- Má to päť nôh, niekedy aj šesť a lozí to po stene, čo je to?\r\nMúdry premýšľa, nechce sa dať zahanbiť, napokon vraví: \r\n- Neviem tu máš 100 korún, tak čo je to? \r\nA hlúpy vraví: \r\n- Vieš čo, ani ja neviem, tu máš 5 korún!', 563, 3.39, 30),
	(6533, 'Blázon svieti baterkou pod posteľou a druhý sa ho pýta:\r\n"Čo robíš?"\r\n"Ále, pozerám či som dobre zhasol."', 115, 3.22, 30),
	(6534, 'Idú dvaja  blázni v aute a zastanú na križovatke. \r\n- Aha červená, tá mi pripomína krásne červené jablko. Aha oranžová, tá mi pripomína chutný pomaranč. Joj, a aha aká krásna zelená. Tá je z nich najkrajšia. Tá mi pripomína sladučké egreše. A červená... tú sme už videli, môžme teda ísť. ', 323, 3.68, 30),
	(6535, 'Ide riaditeľ blázinca po chodbe a otvorí miestnosť a tam sa blázni hádžu s vankúšmi a skáču sem a tam. Riaditeľ sa ich pýta, čo robia a oni mu hovoria, že bombardujú Berlín. Tak im povedal nech radšej obraňujú a išiel do druhej miestnosti kde boli všetci pod posteľami. I tých sa opýtal čo robia, tí vraj ochraňujú Stalingrad. Prešiel do tretej miestnosti a tam sedel jeden na stoličke a druhý ho udieral 5 kilovým kladivom po hlave. Riaditeľ sa pýta:\r\n"Teba to nebolí."\r\n"Nie, veď ja som v tanku."', 535, 3.52, 30),
	(6536, 'Blázon v blázinci kráča po chodbe a ťahá za sebou zubnú kefku. Stretne ho druhý blázon a hovorí: \r\n- Čo ti šibe, čo ťaháš tú kefku za sebou. \r\nA on mu na to: \r\n- No a čo ju mám tlačiť!?', 206, 3.25, 30),
	(6537, 'Sú traja blázni na skale, pod nimi 300 metrová priepasť. Jeden sa rozbehne, skočí a spieva: "Poďme spolu lietať". Druhý skočí za ním a spieva: "Pozri, ja už letím". Tretí sa na nich pozrie dolu a kričí za nimi\r\n- Ak sú dvaja šťastný, nechýba im tretí!\r\nA odíde.', 285, 3.54, 30),
	(6538, 'Dvaja blázni na nemocničnej izbe. Jeden z nich niečo prikrýva rukami a pýta sa druhého: \r\n"Hádaj čo tam mám!" \r\n"Mrakodrap!"\r\n"Ja sa nehrám. Ty si sa pozeral!"', 169, 3.93, 30),
	(6539, 'Sedia dvaja blázni v izbe a jeden hovorí\r\n"Ja som Mojžíš a Pán Boh mi dal desať božích prikázaní "\r\nA druhý mu na to\r\n"To som musel byť fakt dosť opitý, keď som ich dal práve tebe"', 197, 3.36, 30),
	(6540, 'Prijímací test do blázinca.\r\nPočas návštevy v blázinci sa pýta návštevník riaditeľa, podľa akých\r\nkritérií\r\nbude rozhodnuté, či niekto bude zatvorený alebo nie.\r\nRiaditeľ vysvetľuje:\r\nNo, my napustíme vaňu vodou, dáme kandidátovi lyžičku, hrnček a \r\nvedro a poprosíme ho, aby vaňu vyprázdnil."\r\nNávštevník hovorí:\r\nAha, rozumiem, normálny človek vezme vedro, aby to išlo rýchlejšie, že?"\r\nRiaditeľ:\r\nNie, normálny človek vytiahne špunt... Chcete izbu s balkónom alebo bez?"', 519, 4.11, 30),
	(6541, 'Veronika a Michal sú pacientmi na psychiatrii.\r\nJedného dňa sa prechádzajú okolo bazéna a v tom Michal náhle skočí do vody. Potopí sa ako kameň a nevypláva. Veronika okamžite skočí za ním, aby ho zachránila. Ponorí sa na dno a vytiahne Michala.\r\nDozvie sa o tomto hrdinskom čine riaditeľ psychiatrie a okamžite dá príkaz prepustiť Veroniku, pretože zistil, že je duševne úplne v poriadku, stabilná a príčetná.\r\nIde za ňou, aby jej povedal túto správu. "Veronika, mám pre Teba jednu dobrú a jednu zlú správu. Myslím že si mentálne v poriadku, bola\r\nsi schopná zachrániť inému pacientovi život. A tá zlá, Michal, ktorého si zachránila sa krátko potom obesil v kúpeľni. Je mi to ľúto, ale je mŕtvy.\r\nVeronika sa pozrie na riaditeľa a hovorí: \r\n"On nespáchal samovraždu, ja som ho tam zavesila, aby uschol..."', 866, 4.21, 30),
	(6542, 'Príde chlap ku psychiatrovi. Keď sa ho lekár pýta prečo je tu. On odpovedá: \\"Lebo som šialený.\\" Ako ste na to prišli? čo ste si sami určili diagnózu? Odpovedá lekár. Chlapík vytiahne výplatnú pásku, ukáže ju lekárovi a dodá. Vidíte to? Za toľko robím, no nie som šialený?', 300, 3.66, 30),
	(6543, 'Rozprávajú sa dvaja pacienti zo psychiatrie a jeden druhému vraví\r\n- Počuj Deži, ešte šťastie že nie som vták. \r\n- A to už prečo?\r\n- Lebo ja neviem lietať.', 169, 3.48, 30),
	(6544, 'Nový lekár psychiatrickej liečebne sa pri zoznamovaní s pacientmi pýta: \r\n- Vy ste sa sem ako dostali? Porozprávajte nám niečo o povahe vašich problémov.\r\n- Začalo sa to tým, že som sa oženil. To som nikdy nemal robiť! Vzal som si totiž jednu vdovu, ktorá mala dospelú dcéru, ktorá sa stala mojou nevlastnou dcérou. Keď nás prišiel navštíviť môj otec, tak sa do dcéry zamiloval, a potom sa s ňou oženil. Teda moja nevlastná dcéra sa stala mojou nevlastnou matkou. Potom sa mojej žene narodil syn, jej malý brat, môj syn, sa stal mojím strýkom. Z toho tiež vyplýva, že moja žena, ktorá je matkou mojej nevlastnej matky je tiež mojou babičkou a ja som teda jej vnuk. Ale to nie je všetko. Preto, že mám za manželku moju nevlastnú babičku, nie som len jej manžel a vnuk, ale som aj svoj vlastný dedko...\r\n- Už chápete prečo som tu?', 884, 4.23, 30),
	(6545, 'Pýtajú sa jednej baby: "Akého máte psa? Nemeckého ovčiaka?"\r\nA ona na to: "Nie, doviezli sme ho z Trenčína!"', 116, 2.74, 30),
	(6546, 'Ošetrovateľ vojde k bláznovi do izby a vidí, ako ten niečo usilovne píše na hárok papiera. \r\n"Čo to píšeš?" prihovorí sa bláznovi.\r\n"List."\r\n"A komu ho píšeš?"\r\n"Sebe."\r\n"A čo si tam píšeš?"\r\n"Neviem, pošta príde až zajtra!"', 248, 4.28, 30),
	(6547, 'Blázon ide v blázinci po chodbe a ťahá za sebou na povrázku kefu.\r\n"Poď, Boby, poď! Dobrý psíček!" prihovára sa kefe.\r\nPristaví sa pri ňom primár a keďže má dobrú náladu, aj on sa milo prihovorí:\r\n"Tak ako sa dnes darí vášmu psíkovi?"\r\n"Ale veď to nie je pes, ale kefa! Nevidíte?!" ohradí sa blázon.\r\nPrimár sa v rozpakoch otočí a rýchlo odchádza.\r\nNato sa blázon spiklenecky zohne ku kefe a vraví:\r\n" Ale sme s ním vybabrali, však Boby?!!"', 477, 4.28, 30),
	(6548, 'Hluchý sa pýta slepého:                                                  Pridať na Facebook', 95, 3.64, 30),
	(6549, 'Počas návštevy v blázinci sa pýta návštevník riaditeľa, podľa akých kritérií bude rozhodnuté, či niekto bude zatvorený alebo nie.\r\nRiaditeľ vysvetľuje:\r\nNo, my napustíme vaňu vodou, dáme kandidátovi lyžičku, hrnček a kýbeľ a poprosíme ho, aby vaňu vyprázdnili.\r\nNávštevník hovorí:\r\nAha, rozumiem, normálny človek vezme kýbeľ, aby to išlo rýchlejšie, že?\r\nRiaditeľ: Nie, normálny človek vytiahne špunt... Chcete pokoj s balkónom alebo bez?\r\n', 487, 3.76, 30),
	(6550, 'Príde riaditeľ blázinca za bláznami a hovorí im: \r\nBlázni, ak budete celý týždeň dobrý, pustím vás v pondelok do bazéna.\r\nBlázni celý týždeň poslúchajú a v pondelok v bazéne skáču rybičky, šípky... Príde za nimi riaditeľ a hovorí im:\r\nBlázni, ak budete aj ďalší týždeň poslúchať, tak vám napustím aj vodu. ', 347, 3.81, 30),
	(6551, 'Ide muž po ulici a chce vedieť, koľko je hodín. Vidí iba mníšku, ale nevie, ako ju osloviť a tak sa jej pýta:\r\n- Pán farár, samička, koľko je hodín.', 162, 3.27, 31),
	(6552, 'Mladá mníška stopuje a zastaví jej celkom fešný muž. Zoberie ju do auta a pozerá, že cez hábit sa črtajú celkom pekné nohy. Položí jej ruku na koleno.\r\n- Evanjelium Matúša, hlava 23! - skríkne mníška\r\nŠofér ako popálený stiahne ruku a šoféruje ďalej. Po chvíli opäť neodolá a dá jej ruku na stehno.\r\n- Evanjelium Matúša, hlava 23! - skríkne mníška\r\nŠofér sa pre istotu prekrižuje, čo ak zhrešil, a potom doma rýchlo vytiahne bibliu, listuje v nej až nájde Matúša, hlava 23 a číta:\r\n"Synku, si na správnej ceste!"', 562, 3.56, 31),
	(6553, 'Ježiš visí na kríži, pod ním dav ľudí a stráž. Ježiš kričí:\r\n- Peter! Peter!\r\nPeter vyrazí k nemu. Strážca mu hovorí:\r\n- Nechoď, Peter! Odseknem ti ruku!\r\n- Ale ja musím, pán má volá!\r\nVtom Ježiš zasa zakričí:\r\n- Peter! Peter!\r\nPeter sa pretlačí cez štvoro stráži, odseknú mu ruky, nohy... potom hovorí:\r\n- Áno, Ježiš? Počúvam tvoje slová.\r\nJežiš sa usmeje a hovorí: \r\n- Peter! Ja odtiaľto zhora vidím tvoj rodný dom!', 463, 3.4, 31),
	(6554, 'Príde chlap za farárom.\r\n- Pán farár, zdochol mi pes. Potrebujem, aby ste mi ho pochovali.\r\n- V žiadnom prípade, veď to bol pes. Zviera nemá dušu, nemôžem.\r\n- Viete pán farár, mal som ho dvadsať rokov, verne mi služil, pochovajte ho.\r\n- V žiadnom prípade, už som povedal!\r\n- Pán farár, dám vám 20.000.-Sk, ak mi ho pochováte.\r\n- Tak to ste mali hneď povedať, že bol katolík!', 401, 3.49, 31),
	(6555, 'Jednu hriešnicu idú ukameňovať. V tom príde Ježiš a hovorí:\r\n- Kto je bez viny nech ako prvý hodí kameň?\r\nOkolo Ježišovej hlavy preletí veľký balvan. Ježiš sa pomaly otočí a hovorí:\r\n- Mami! A ty tu čo robíš?', 232, 3.57, 31),
	(6556, 'Videli ste už kostol zo zemiakov? \r\nŽe nie? Veď je to jednoduché! Keď budete sadiť zemiaky, pozrite sa na kostol.', 119, 2.8, 31),
	(6557, 'Prečo Ježiša Krista neutopili, ale ukrižovali?\r\nA kto už by chcel mať nad dverami akvárium?', 98, 3.17, 31),
	(6558, 'Diana stretne v nebi sv. Petra. Ten sa jej pýta:\r\n"Prečo máš svatožiaru?"\r\n"To nie je svatožiara, to je volant."', 118, 3.38, 31),
	(6559, 'Hlboko veriaca žena je vydatá už 25 rokov a porodila dokopy 17 detí.\r\nJej muž umrie, ona sa po čase opäť vydá a porodí ešte dve deti. Aj druhý muž jej umrie a neskôr aj ona. Počas jej pohrebu kňaz zdvihne oči k nebu a hovorí:\r\n"Konečne sú spolu!"\r\nNa to sa niekto z pozostalých pýta:\r\n"Kto vaša svätosť? Ona s prvým manželom, alebo ona s druhým manželom?"\r\n"Myslel som jej nohy."', 408, 3.86, 31),
	(6560, 'Po tvrdej zime v minulom roku sa muž zo Seattlu rozhodol ísť na dovolenku na Miami Beach, kde sa mal stretnúť so svojou ženou, ktorá mala  dokončiť svoju služobnú cestu do Minneapolis. Obaja sa tešili na pekné počasie a spoločný čas, ktorý spolu strávia. Ale naneštastie, na letisku sa stala chyba a mužovi povedali, že musí počkať na neskorší let. Skúšal sa sťažovať, ale povedali mu, že to nemá význam a môžu byt problémy. Nasledujúci deň po príchode do hotela na konci svojej cesty zistil, že v Miami je “horúca vlna” a že tam je tak nepríjemné horúco, ako v Seattli nepríjemné zima. Recepčný v hoteli mu povedal, že jeho žena príde tak, ako sa dohodli. Už nemohol vydržať, kým sa schladí v bazéne, a preto rýchlo napísal e­mail svojej žene, no v chvate urobil chybu v adrese. A tak email prišiel do domu staršej kňazovej ženy, ktorej muž zomrel len deň predtým. Keď si žialiaca vdova otvorila a prečítala správu, vydala zo seba hrozný výkrik a padla na zem mŕtva. Jej rodina sa ponáhľala do izby a na monitore si prečítala text: \r\n\'Najdrahšia žena. Ako vieš, odišiel som včera, no len teraz ma zaregistrovali. Pri vstupe bol nejaký chaos, a moja sťažnosť bola zamietnutá. Recepčný mi potvrdil tvoj zajtrajší príchod. Tvoj milujúci muž. P.S.: Veci nie sú tak, ako sme si mysleli. Budeš veľmi prekvapená, ako je tu dolu horúco.\'', 1439, 4.18, 31),
	(6561, 'Dostane sa Karol do neba. Na raňajky dostane biely jogurt a pečivo. Karol pozrie dolu do pekla a tam majú salámy, syry, pašteky. Tak si zje ten svoj jogurt. Na obed zase dostane jogurt a pečivo. Pozrie dolu do pekla a tam sa im stoly prehýbajú, majú tam veľké myši, prasatá, ryby. Tak zasa nič nehovorí a zje si ten svoj jogurt. No a na večeru zasa dostane jogurt s pečivom a zasa v pekle majú torty, rezne, zemiaky. Tak to mu už nedá a spýta sa Pána Boha.\r\n- Prečo my máme stále len jogurty a pečivo a v pekle majú samé dobroty? \r\nA on mu odpovedá: \r\n- Nuž Karolko, myslím si, pre dvoch sa neoplatí variť.', 639, 3.53, 31),
	(6562, 'Niekto búcha na nebeskú bránu. Svätý Peter sa pýta:\r\n- No? Čo je?\r\n- Nie čo je, ale kto je?\r\n- Preboha, ďalšia učiteľka.', 132, 3.81, 31),
	(6563, 'Ak hovoríš k Bohu - modlíš sa.\r\nAk Boh hovorí k tebe - máš schizofréniu.', 80, 3.49, 31),
	(6564, 'Idú ženské do neba a pri bráne ich zastaví sv. Peter.\r\n"Kam idete ???"\r\n"No do neba??"\r\n"Tak dobre. Ktorá z Vás za celý život ani raz nezhrešila, môže ísť ďalej. Pre ostatné - tam je smer do pekla."\r\nVšetky sa otočia a vyrazia smerom k peklu až na jednu. Tá ide stále ďalej. Sv. Peter sa zamyslí a zakričí:\r\n"Hej, ale tú hluchú si zoberte so sebou !!!"', 379, 3.45, 31),
	(6565, 'Sedí človek doma, pozerá telku a je pukance, keď zrazu počuť \'klop - klop\'.\r\n- Kto je?\r\n- Tu svedkovia Jehovovi.\r\n- Čo chcete?\r\n- Porozprávať sa.\r\n- Koľkí ste??\r\n- Dvaja.\r\n- Tak prečo sa neporozprávate?', 215, 3.73, 31),
	(6566, 'Príde Žid do neba a búcha na nebeskú bránu. Otvorí svätý Peter a pýta sa:\r\n- Čo chceš, Žid?\r\n- Chcel by som sa, prosím, rozprávať s Ježišom.\r\nSvätý Peter na to:\r\n- A čo, chceš ho poprosiť o odpustenie, že ste ho ukrižovali?\r\n- Nie, on nám totiž ešte nezaplatil za poslednú večeru.', 309, 3.37, 31),
	(6567, 'Svätý Peter stojí pri bráne do Raja a pred ním sa otáča dokolečka nejaká ženská. Príde tam pán Novák, ktorý žil cnostne a tak prišiel priamo do Raja. Pozerá a hovorí Sv. Petrovi:\r\n"Počúvaj, to je moja susedka. Prečo sa točí dokola?"\r\n"No, každá ženská, ktorá bola mužovi neverná sa musí otočit toľkokrát, koľkokrát mu zahla. Tvoja susedka zahla svojmu mužovi desaťkrát."\r\n"Aha... A je v Nebi moja žena?"\r\n"Jasné....... u mňa v kancelárii ...... robí tam ventilátor!"', 512, 3.45, 31),
	(6568, 'Príde Dežo na spoveď a hovorí:\r\n- Pán farár, ukradol som v butiku sako.\r\n- Tak to oľutuj, Dežo.\r\n- Ľutujem, že som neukradol aj nohavice.', 147, 3.55, 31),
	(6569, 'Mladá dievka príde do spovedelnice. \r\n"Otče, zhrešila som. Mala som pohlavný styk." \r\nFarár je tam nový a má sadzobník pre jednotlivé hriechy. \r\nNájde pohlavný styk a hovorí: \r\n"Milé dieta, dvakrát otčenáš a trikrát zdravasmária a bude ti odpustené." \r\n"Ale otče, ja som to mala aj zozadu." \r\nFarár zase chvílku listuje a hovorí : \r\n"Päťkrát otčenáš a štyrikrát zdravas a bude ti odpustené." \r\n"Otče, ja som mu ho vzala aj do pusy." \r\nFarár zase listuje, ale orálny sex tam nemôže nájsť. Tak beží za starým kostolníkom, ktorý tam zažil i minulého farára. \r\n"Milan, prosím vás, neviete koľko dával pan farár za orálny sex?" \r\n"No, ako komu, mne dával dvadsať !"', 717, 3.32, 31),
	(6570, 'Boh príde na zem za Mohamedom a hovorí mu:\r\n- Mám pre teba pár prikázaní. \r\n- To čo je?\r\n- Napríklad, že nezosmilníš.\r\n- Nie, tým nás prosím ťa neobťažuj, to neprejde, však poznáš arabskú mentalitu.\r\nPán Boh to skúsi u Cigáňov. Príde za vajdom: \r\n- Mám pre vás prikázania.\r\n- To čo je?\r\n- Napríklad, že nepokradneš.\r\n- Nie, neblbni, to cigáňom zoberieš podstatu kultúry, to neprejde, kašli na to.\r\nTak Pán Boh do tretice skúša u Židov, ide k Mojžišovi a hovorí:\r\n- Počuj, Mojžiš, mám tu pre vás prikázania.\r\n- Koľko stoja?\r\n- Nič, sú zadarmo.\r\n- Tak daj aj zo desať.', 621, 3.85, 31),
	(6571, 'Pán Boh sa rozhodol - Adam a Eva budú mať deti. Zavolal si Adama a povie mu:\r\n- Adam, choď za Evou a pobozkaj ju!\r\nAdam však nevedel čo to je a tak mu to Boh stručne vysvetlil. Po čase sa Adam vráti a je celý uveličený. Boh vidí, že sa mu to páčilo, tak pokračuje v ďalšom školení:\r\n- Choď za Evou a poláskaj sa s ňou!\r\nAdam opäť nechápavo pozerá a tak pán Boh mu to znovu stručne vysvetlí. Po dlhšom čase sa Adam vráti späť a je úplne spokojný, natešený. Boh vidí, že Adam robí pokroky, tak pristúpi na to najdôležitejšie:\r\n- Adam, choď za Evou a pomiluj ju!\r\nAdam nechápavo pozerá čo Pán od neho vlastne chce, veď doteraz to bolo všetko také užasne, takže pán Boh mu opäť všetko vysvetlí. Natešený Adam uteká plný očakávania za Evou. Po chvíli sa vráti. Celý je akýsi nesvoj a nakoniec sa spýta:\r\n- Pane, môžeš mi povedať čo je to migréna?', 920, 3.31, 31),
	(6572, 'Príde matka Tereza do neba. Svätý Peter ju privíta a pýta sa, či jej nebude vadiť, ak na večeru budú len zohriate párky s chlebom. Matka Tereza vo svojej skromnosti súhlasí. Keď však dostane párky aj na druhý a ďalší a ďalší deň, pýta sa:\r\n- Svätý Peter, ale prečo stále jeme iba párky?\r\n- No, kvôli dvom sa predsa neoplatí variť.', 362, 3.19, 31),
	(6573, 'Do kostola príde totálne ožratý chlapík, sadne si do spovedelnice a mlčí. Farár trochu v rozpakoch zakašle, aby vzbudil chlapíkovú pozornosť. Ten však mlčí ďalej. Farár ešte viac v rozpakoch zaklope. V tom sa odvedľa ozve:\r\n- Klopeš márne kámoš, ani ja tu žiaden hajzel papier nemám!', 308, 3.26, 31),
	(6574, 'Po atentáte na pápeža tlačové agentúry obviňujú ruskú KGB.\r\nRuská KGB sa bráni tvrdením, že pápež vytiahol revolver ako prvý.', 141, 3.41, 31),
	(6575, 'Chudák papež umrel a jde do nebe. Zaťuká na bránu, vykoukne Sv. Petr a povída:\r\n"Jmeno?"\r\n"Svatý Otec."\r\nPetr projede na terminálu databázi a říká:\r\n"Je mi líto, ale nikdo takový do nebe přijít nemá."\r\n"Tak zkuste Jan Pavel II."\r\n"Ne, ani ten tady není."\r\n"Tak zkuste, ech... jo, už vím, Wojtyla, Karel."\r\n"Ne, nikdo takový v počítači není, pane."\r\nNačež se papež rozčílí:\r\n"To snad neni možné! Já si celý život odříkam, snažím se jít příkladem, stamiliony lidí dole na zemi mě uctívají, veří mi, a vy me teď nechcete pustit do nebe? Jak si to představujete? Co to má znamenat???"\r\nA Svatý Petr ukázal prstem:\r\n"Podívejte se tamhle nahoru a usmějte se, tam je skrytá kamera."', 732, 3.58, 31),
	(6576, 'Farar učí mníšku plávať.\r\n"Otče, naozaj sa utopím ak vyberiete váš prst von?"', 87, 4, 31),
	(6577, 'Pani katechétka sa na prvej hodine náboženstva pýta:\r\n- Ako sa voláš?\r\n- Pepepeter.\r\n- Prepáč, nevedela som že si koktavý.\r\n- Ja nie, ale zato kňaz ktorý má krstil.', 177, 3.32, 31),
	(6578, 'Rok 33. Palestína. Ráno po svadbe v Káni Galilejskej. Svadobčania sa pomaly prebúdzajú z\r\nťažkej opice. Väčšina sa drží za hlavu a stoná. Otec nevesty prosí:\r\n- Ja mám neskutočný smäd. Skočte niekto po vodu.\r\nJežiš sa zdvihne, že teda ide on. V tom všetci zborovo vykríknu:\r\n- Nie, nie! Ty už prosím, nie!', 332, 3.54, 31),
	(6579, 'Ježiš Kristus sa rozhodne spasiť svet. Príde do NY, zaklope na dvere a hovorí:\r\n- Som Ježiš Kristus a prišiel som spasiť tento svet. Otvorte mi dvere vášho príbytku.\r\nOtvoria sa dvere a ozve sa:\r\n- Čo si si šlahol? Okamžite vypadni!\r\nZhrozený Ježiš si teda povie, že v kultúrnejšej Európe to bude lepšie. Ide do Londýna a zaklope.\r\n- Som Ježiš Kristus a prišiel som spasiť tento svet. Otvorte mi dvere vášho príbytku.\r\nNakukne sluha a hovorí:\r\n- Tu máš 2 libry a vypadni! Nech ťa tu už nevidím!\r\nZhnusený Ježiš si ešte spomenul na sväté mesto a vybral sa tam:\r\n- Som Ježiš Kristus a prišiel som spasiť tento svet. Otvorte mi dvere vášho príbytku.\r\nOtvoria sa dvere, vykukne starý Žid a zvolá:\r\n- Jakob, dones klince a kladivo! Zas je tu!', 790, 3.49, 31),
	(6580, 'Ide misionár po púšti a oproti nemu lev. Misionár: \r\n- Ó Pane, daj tomuto levovi kresťanské cítenie. \r\nLev zrazu zdvihne laby k nebu a hovorí: \r\n- Ďakujem ti Pane, za toto jedlo, ktoré teraz požívať budem.', 219, 3.46, 31),
	(6581, 'Viete, aký je rozdiel medzi evanjelickým a katolíckym farárom?\r\nEvanjelický má plienky povešané vo svojej záhrade a katolícky vo všetkých naokolo.', 158, 3.3, 31),
	(6582, 'Farár učí mníšku plávať. Po chvíli sa mníška pýta:\r\n- A naozaj sa utopím, keď ten palec vyberiete?', 111, 3.05, 31),
	(6583, 'Mníška ide po lese a znásilní ju rytier. Po znásilnení sa rytier pýta mníšky čo povie matke predstavenej. Mníška odpovedá:\r\n- Išla som po lese a tri krát má znásilnili.\r\nRytier sa zarazí a hovorí:\r\n- Ale veď som vás len jedenkrát znásilnil.\r\n- A Vy už nemôžete?', 287, 3.81, 31),
	(6584, 'Chlapík spadne z útesu, postaví sa, opráši a znova vylezie hore. Skočí, dopadne, vstane a tak stále dokola...\r\nVídí ho druhý a tiež si to chce skúsiť, veď ani tomu prvému sa nič nestalo.\r\nSkočí a ten prvý si v duchu hovorí: No, na to, že som anjel som riadna sviňa!', 288, 3.62, 31),
	(6585, 'Ide Naco po Malackách na bycikli a zrazu oproti nemu ide mníška.\r\nZrazí ju, mníška padne na zem ako vreco a Naco povie:\r\n"No ja sem si mysueu, že si vječší frajer Batmane."', 182, 3.8, 31),
	(6586, 'Do ordinácie vstúpi chudý bledý muž. \r\n- Neustále má boli hlava, pán doktor - sťažuje sa slabým hláskom. \r\n- Fajčíte?\r\n- Nie, moje telo je chrámom ducha, tu odpornú smradľavú vec by som nikdy nevzal do úst.\r\n- A pijete alkohol?\r\n- Chráň Pán Boh - ohradí sa muž. Ako by som sa mohol oddávať takému hriechu?\r\n- Ospravedlňujem sa. A máte rad ženy?\r\n- Nikdy - odpovie vzdorovito muž a bojovne vystrčí bradu. S tými skazenými stvoreniami, ktoré sú nádobami hriechu, odmietam mať čokoľvek spoločné. Som čistý a čestný, rozumiete?\r\n- V poriadku - súhlasí lekár. Teraz už chápem, prečo vás stále boli hlava.\r\n- A prečo teda?\r\n- Máte priveľmi tesne utiahnutú svätožiaru.', 722, 3.29, 31),
	(6587, 'Pýta sa Hasan Mohameda:\r\n- Ty, Mohamed, počúvaj, vieš pilotovať lietadlo?\r\nMohemed mu odpovie:\r\n- Nie.\r\nHasan mu nato: \r\n- Tak aký si to moslim?', 150, 3.08, 31),
	(6588, 'Zomrie hlava rodiny. Na pohrebe farár vyzdvihuje jeho číny a hlavne, aký to bol dobrý a starostlivý otec. Plačúca matka sa nahne k synovi a plačúc mu hovorí:\r\n- Pozri sa prosím ťa do rakvy, neviem, či sme na dobrom pohrebe.', 237, 3.31, 31),
	(6589, 'Farár hovorí veriacim na omši:\r\n- Drahí veriaci!\r\n- Mám pre vás jednu dobrú správu a jednu zlú správu. Tá dobrá je, že máme dosť peňazí na opravu kostola. Zlá správa je, že tieto peniaze sú vo vašich vreckách.', 232, 3.57, 31),
	(6590, 'Čo je to "papamobil"?\r\nTo je to terárium, v ktorom ukazujú pápeža.', 71, 2.94, 31),
	(6591, '"Panebože, pomôž, čo len urobím, ako sa to len mohlo stať?" horekuje Žid.\r\nOdkiaľsi zhora sa ove mohutný hlas:\r\n"A čo sa ti stalo?"\r\n"Môj syn, dieťa jediné, konvertoval na kresťanstvo."\r\n"To veľmi dobre poznám," buráca hlas zhora.\r\n"A čo si potom urobil?"\r\n"Nuž čo. Napísal som Nový zákon."', 313, 3.23, 31),
	(6592, 'Pápež zomrie a príde do neba. Zabúcha na vráta a vtom mu otvorí akýsi hipisák v rúchu, sandáloch, kučeravé dlhé vlasy, náušnička v uchu a pýta sa čo chce.\r\nPápež vraví: \r\n- Chcem do neba, umrel som a tak som tu!\r\nSv. Peter: \r\n- A kto si?\r\n- Ja som pápež.\r\nSv. Peter zapne počítač, naťuká PÁPEŽ pozerá a vraví: \r\n- Nemáme tu nijakého pápeža, choď preč.\r\nPápež na to: \r\n- Ale to nie je možné. Ja som hlava katolíckej cirkvi, som zástupca Boha na zemi, som pápež Ján Pavol Druhý. Celý život som služil Bohu, zomrel som a teraz som tu. Chcem hovoriť so Svätým Petrom. \r\n- Ja som Svätý Peter. Vydrž chvíľu hneď sa na to pozrieme.\r\nNaťuká JÁN, nič, naťuká PAVOL, nič, naťuká DRUHÝ nič. Vraví: \r\n- Počúvaj sem, vravím ti, že ťa tu nečakáme, tak odpáľ, lebo bude zle!\r\nPápež zhrozený začne prosíkať: \r\n- Prosím vás, to nie je možné, musím tam niekde byť, určite má máte pod občianskym menom Karol Wojtila, pozrite sa na to.\r\nSv. Peter už stráca trpezlivosť, ale naťuká KAROL, nič, WOJTILA, nič. Evidentne nasratý ziape na pápeža:\r\n- Počúvaj, vravím ti, že ťa tu nečakáme, tak vypadni, lebo zavolám anjela s ohnivým mečom a ten ti rozpára zadok!\r\nPápež celý zronený odchádza preč. Celá jeho viera je zrútená. V tom pribehne Sv. Peter a vraví:  \r\n- Neblbni, poď, to je skrytá kamera.', 1403, 2.88, 31),
	(6593, 'Vraví Boh Eve v raji:\r\n- Eva, zhrešila si. Zato budeš platiť krvou.\r\n- A nemohla by som v mesačných splátkach?', 117, 3.44, 31),
	(6594, 'Lekár: - Fajčíte?\r\nPacient: - No občas si zapálim, ale keď sa rozbehnem, vyfajčím aj celú škatuľku.\r\nLekár: - Pijete?\r\nPacient: - No občas si dám pohárik - dva. Ale ak sa rozbehnem, pokojne vypijem aj celú fľašu.\r\nLekár: - Súložíte?\r\nPacient: - Tak dva - tri krát do týždňa.\r\nLekár: - No to nie je ktoviekoľko!\r\nPacient: - No tak, na kňaza z malého mesta? \n', 387, 4.18, 31),
	(6595, 'Mojžiš po zostupe zo svätej hory sa prihovára k svojmu národu:\r\n- Milí židia, mám pre vás dve správy. Jednu dobrú a jednu zlú. Tá dobrá je, že po náročných bilaterálnych rokovaniach s Bohom som skresal navrhovaných 20 prikázaní len na 10 a tá zlá je, že nezabiješ a nezosmilníš je tam. ', 314, 3.6, 31),
	(6596, 'Mníšky sa vrátili z výletu v Jeruzaleme. \r\n- A ako sa vám tam darilo? - hneď sa pýtali ostatné mníšky.\r\n- Leteli sme lietadlom, lietadlo spadlo a zachránila nás jedna loď s potravinami. Tam nás ale všetky znásilnili, až na sestru Annu. Tu loď prepadli piráti, uniesli nás a všetky znásilnili, až na sestru Annu. Keď sme už vracali z Jeruzalema, autobus sa pokazil, zavolali sme odťahovú službu a išli sme do hotela, kde nás všetky znásilnili, až na sestru Annu, a teraz sme tu.\r\n- A prečo nikdy neznásilnili aj sestru Annu? Je škaredá alebo čo?\r\n- Nie, ona nechcela.', 604, 3.46, 31),
	(6597, 'Miništrant príde do kostola a hovorí farárovi:\r\n- Pán farár, včera som našiel hodinky.\r\n- Dúfam, že si si ich nenechal.\r\n- Nie, už som ich predal.', 157, 3.4, 31),
	(6598, 'Farár si umýva auto. V rámci širokého ekumenizmu sa rozhodne, že umyje auto aj susedovi - rabínovi. Vezme vedro vody a s radostným úsmevom, chváliac Pána za tento dobrý skutok, ktorý mu pripravil, uskutoční svoj úmysel. Ledva skončil umývanie, ozve sa divný škripot. Obzrie sa a vidí rabína s pílkou, ako píli výfuk na jeho aute.\r\n- Prečo mi píliš výfuk?\r\n- Ty si moje auto pokrstil, ja tvoje obrežem!', 431, 4.17, 31),
	(6599, 'Apoštoli oslavujú v záhrade a ide okolo Ježiš. Spýta sa Petra:\r\n- Prečo oslavujete?\r\nPeter na to:\r\n- Judáš niečo predal.', 130, 4.01, 31),
	(6600, 'Panna Mária a Svätý Jozef sa skláňajú nad jasličkami s dieťatkom. Vtom vojdu pastieri s darmi, obzrú si dieťa a povedia:\r\n- Ježišinku, ten je ale krásny! \r\nSvätý Jozef sa nakloní k Panne Márii a hovorí:\r\n- Vidíš, to je meno pre nášho malého a nie Hugo!', 275, 3.73, 31),
	(6601, 'Príde muž na spoveď a hovorí. \r\n- Pán farár, zhrešil som. Viete, bol som na služobnej ceste. Boli sme ubytovaní v hoteli a kedže nebola voľná samostatná izba, dali ma do izby s nádhernou ženou. Krv a mlieko. Spali sme na manželských posteliach a ...\r\n- Tak sa to stalo, synku, bol si s inou ženou.\r\n- Nie, otče, nič sa nestalo, ale myšlienkami som zhrešil.\r\n- Dobre, tak za pokutu sa pomodli päť krát otčenáš a päť krát zdravas. A vypiješ vedro vody.\r\n- Ale prečo mám vypiť vedro vody?\r\n- Pretože taky vôl, ako ty, si nič iné nezaslúži.', 577, 3.33, 31),
	(6602, 'Obchodník na ulici:\r\n- Kúúpujte sväté obrááázky!!! Krista, Boha, Máááriu.', 84, 3.35, 31),
	(6603, 'Príde delegácia na návštevu do pekla a za sprievodcu dostanú flegmatického čerta. Ten ich začne sprevádzať po pekle a vojdu do prvej miestnosti. V tej sa nachádza veľký počet ľudí, ktorí sa bavia, radujú proste si užívajú. Delegáti sa pýtajú, že čo to má znamenať. Čert hovorí:\r\n- Oni si za života užívali, samá párty a večierok, tak majú to, čo robili.\r\nIdú ďalej a prídu do ďalšej miestnosti. Tam samy sex, sado-maso, proste erotika na všetky spôsoby. Čert vraví:\r\n- Za života nič iné nerobili, len toto, tak to majú aj tu.\r\nNo a vojdu do tretej miestnosti. Miestnosť je obrovská, len uprostred sa nachádza veľký kotol, pod ktorým je zakúrené. Pri kotli stojí unudený čert opierajúci sa o vidly. Zrazu sa niekto vynorí z toho kotla, čert sa preberie, treskne ho po hlave, ťa sa ponorí a čert zaujme znova tu istú unudenú polohu. Delegáti, že čo to má byt.\r\nČert vraví: \r\n- No to sú kresťania, oni to tak chceli.', 991, 3.27, 31),
	(6604, 'Viete, kedy je farár najviac vzrušený?\r\nKeď pretiahne omšu.', 64, 3.33, 31),
	(6605, 'Čo sa stane s farára, keď ho prejde parný valec?\r\nSvätý obrázok!', 71, 3.27, 31),
	(6606, 'Veľká autohavária. Obe autá sú riadne zošrotované, no obom účastníkom sa ako zázrakom nič nestane. Účastníkom je rabín a kňaz. Pri vystupovaní si rabín všimne, že v druhom aute sedí kňaz. Vystúpi z auta a vraví:\r\n- Toto musí byť božia vôľa, božie znamenie pre nás oboch, nech žijeme vedľa seba v svornosti celý život.\r\n- Boh nás osvietil, spravíme čo nám vnukol.\r\n- Aha, auto je celkom rozbité, no omšové víno zostalo celé. Zapime naše zblíženie. - hovorí rabín a ponúkol kňaza.\r\nTen si riadne uchlipne a podá rabínovi fľašu späť. Ten ju zaštupluje a odloží.\r\n- A vy sa nenapijete na zmierenie?\r\n- Nie, ďakujem, ja radšej počkám na policajtov.', 708, 3.41, 31),
	(6607, '- Pán doktor, pán doktor podarila sa operácia?\r\n- Nehovorte mi pán doktor, ja som svätý Peter!', 100, 3.2, 31),
	(6608, 'Učiteľka:\r\n- Zajtra oslavujeme narodenie Ježiša Krista. A viete mi povedať, kde sa teraz nachádza Ježiš Kristus?\r\nAnička:\r\n- On je v mojom srdiečku.\r\nJožko:\r\n- On je na nebesiach\r\nMóricko:\r\n- On je u nás na záchode..\r\nUčiteľka:\r\n- Čože?\r\nMóricko: \r\n- Nooo, otec každé ráno dobehne k záchodu, skúša kľučku, nič, búcha na dvere, nič, tak zreve "Ježiši Kriste, ešte si stále tam?"', 411, 3.68, 31),
	(6609, 'Mara sa priznáva na spovedi:\r\n- Otče, tri razy som zhrešila.\r\nFarár vezme kalkulačku, niečo na nej dlho počíta a potom vraví:\r\n- Choď, dcéra moja, a pomodli sa štyri otčenáše!\r\nO týždeň sa Mara opäť priznáva na spovedi:\r\n- Otče, dva razy som zhrešila.\r\nFarár vezme kalkulačku, niečo na nej dlho počíta a potom vraví:\r\n- Choď, dcéra moja, a zhreš ešte raz. Nejaké sprosté zlomky mi tu vychádzajú.', 432, 3.28, 31),
	(6610, 'Príde chlap do kostola a už od vchodu kričí:\r\n"Poďte všetci do krčmy, všetkých Vás pozývam."\r\nZrazu sa otvoria dvere na spovedeľnici, z ktorej vystrčí hlavu farár aby spozoroval čo sa deje. Chlap na to:\r\n"A ty až dotlačíš, tak príď za nami."', 263, 3.55, 31),
	(6611, 'V dedine sa chystá veľkolepá omša na počesť Pána. V deň omše ale ochorie organista. Pán farár zvolá poradu:\r\n- Sestry a bratia! Stala sa nepríjemná vec. Dnes v deň osláv nášho Pána ochorel náš organista občan Milan Prepelica a tak sa vás pýtam, sestry a bratia, nepoznáte niekoho, kto by mohol nahradiť brata Milana?\r\n- Snáď Dežo, ten vie hrať na husliach.\r\nNápad schvália. O niekoľko hodín sa omša začne a pán farár spieva:\r\n- Ó, Pane Bože, odpusť nám...\r\nA pohotový Dežo:\r\n- Já ti za klobúčik pierko dááám.', 558, 3.25, 31),
	(6612, 'Jde farár a šlápne do hovna.\r\n"Hergot, hovno! Sakra, rek jsem \'hovno\'! Do prdele, rek jsem \'sakra\'! Kurva, rek jsem \'do prdele\'! A seru na to, stejne jsem nechtel bejt farárem!"', 181, 3.42, 31),
	(6613, 'Sedliakovi umrie najskôr koza, krava a nakoniec i manželka. Zničený sedliak si sadne na medzu a bedáka:\r\n- Panebože, čo som urobil, že ma takto tresceš?\r\nZjaví sa Pán Boh, škriabe sa po brade a hovorí:\r\n- Ja ti vlastne ani neviem, ty ma jednoducho nejako serieš!', 276, 3.22, 31),
	(6614, 'Tri mníšky sa bavia:\r\nPrvá hovorí: \r\n- Keď som upratovala u pána farára, našla som mu na záchode porno časopisy!\r\nDruhá: \r\n- Ja som mu zasa v spálni našla kondómy. A viete čo, všetky som poprepichovala špendlíkom.\r\nTretia: \r\n- A do predele!', 258, 3.81, 31),
	(6615, 'Dostane sa muž do neba a sv.Peter mu hovorí:\r\n- Tu máš telefón,môžeš hocikomu zavolať.\r\n- Naozaj? Aj Pánbožkovi?\r\n- Áno,hocikomu.\r\nChlapík sa rozhodol, že zavolá panne Márii.\r\n- Panna Mária, prečo si na všetkých obrazoch a sochách smutná?\r\n- Vieš, keď ja som chcela dievčatko.', 301, 3.29, 31),
	(6616, 'Malé dievčatko dostane krásne nové šaty, v ktorých sa veľmi ponáhľa do školy. Uteká, uteká, a kedže nechce prísť do školy neskoro, takto sa modlí k bohu: \r\n"Pánbožko milý, prosím ťa, nech nezmeškám. Pánbožko milý, nech nezmeškám."\r\nAko tak uteká, potkne sa, spadne do kaluže a celá sa zašpiní. Vstane, uteká ďalej a hovorí:\r\n"Pánbožko, milý, prosím ťa, nech nezmeškám, ale už ma nesácaj."', 434, 3.18, 31),
	(6617, 'Se čtyřmi jeptiškami se zřítí letadlo. Přijdou k nebeské bráně, kde na ně čeká svatý Petr. Dříve, než je pustí do nebe, ptá se první jeptišky, jestli se někdy dotkla pánského údu. Jeptiška odpoví, že jej pouze viděla. Svatý Petr jí  nařídí, aby si v nádobě se svěcenou vodou vypláchla oči. Ptá se druhé jeptišky, jestli se někdy dotkla pánskeho údu. Jeptiška odpoví, že ano, ale pouze rukou. Sv. Petr jí nařídí, aby si omyla ruku ve svěcené vodě a pustí ji dál. V tom\r\nse čtvrtá jeptiška tlačí před třetí a na Petrův dotaz, kam se žene, říká:\r\n"Já bych si s dovolením vykloktala dříve, než si do toho sestra Marie sedne."', 696, 3.37, 31),
	(6618, 'Pápež dostal do daru nové Porsche. Raz povie svojmu vodičovi: \r\n- Dovoľ mi sadnúť si za volant a trochu si zajazdiť.\r\nTen najprv váha, ale potom privolí. Pápež to vytiahne na 200km/h, keď ho zrazu zastavia policajti. Jeden z nich pristúpi k okienku, ktoré sa pomaly otvorí. Zbadá pápeža za volantom a nervózne hovorí:\r\n- Ospravedlnte ma na moment.\r\nPribehne ku kapitánovi a hovorí:\r\n- Pán kapitán, neviem, či mu mám dať pokutu, alebo nie. Je to totiž veľké zviera.\r\nKapitán:\r\n- Je to azda predseda parlamentu?\r\n- Kdeže, väčšie zviera.\r\n- Hádam sám prezident?\r\n- Nie, niekto oveľa vačší!\r\n- Tak to môže byť len pápež.\r\n- Pápež? ten mu robí len šoféra!', 702, 3.55, 31),
	(6619, 'Farár si dá zavolať tri jeptišky a hovorí im,\r\n"každá z vás doneste do kostola toľko sviečok koľko krát ste v živote zhrešili."\r\nNa druhý deň idú jeptišky do kostola. Jedna nesie vedro plné sviečok, druhá ide spolu z ňou a tlačí fúrik plný sviečok. Zrazu počujú hluk. Keď sa otočia uvidia tretiu ako ide smerom k nim na tatrovke plnej sviečok a kričí:\r\n"Nabok kozy, ešte raz to otočím!"', 423, 3.18, 31),
	(6620, 'Kostolník nalieva víno, netrafí sa a povie:\r\n"Do riti zasa vedľa."\r\nKňaz ho napomenie:\r\n"V kostole sa nenadáva!"\r\nTo sa zopakuje asi dva razy a do kňaza vrazí blesk a zabije ho. O pár sekúnd bolo počuť:\r\n"Do riti zasa vedľa!"', 238, 3.17, 31),
	(6621, '11. božie prikázanie:\r\nCti syna svojho, aby ťa nevyhodil z domu tvojho.', 74, 3.25, 31),
	(6622, 'Podnapitý muž sa vracia z krčmy a zastaví sa pred malým obchodíkom, kde je vo výklade vyvesený Ježiš Kristus na kríži. Keďže sa mu veľmi páči, vojde do obchodu a povie predavačke:\r\n- Pani predavačke, koľko stojí ten kríž vo výklade?\r\n- 500 Sk\r\n- Tak si ho kúpim, ale prosím, bez toho artistu.', 318, 3.1, 31),
	(6623, 'Cestujú spolu učiteľ, blondína a farár vo vlaku v jednom kupé a lúštia tú istú krížovku. Blondína sa opýta učiteľa:\r\n"Prosím Vás, časť ženského tela na štyri, začína na p a končí na a."\r\nUčiteľ rozmýšľa, rozmýšľa a pochvíli povie: \r\n"Päta."\r\nNa to sa ozve farár:\r\n"Nemá niekto gumu?!"', 323, 3.38, 31),
	(6624, 'Přišel mladý muž ke zpovědi a povídá:\r\n"Vaše ctihodnosti, hřešil jsem, měl jsem nemanželský poměr."\r\n"To musela být ta krásná panička Petra Smejkalová!" \r\n"Ne, ctihodnosti, nerad bych prozradil její jméno," odpověděl mladík. "Tak to musela být ta hezoučká cikánka Aranka Holomková!"\r\n"Ne, ctihodnosti, nerad bych prozradil její jméno," na to mladík. "Tak tedy zcela určitě ta přistěhovalá nádherná ruska Olga Četčenkovová!"\r\n"Ne, ctihodnosti, nerad bych prozradil její jméno," opět tvrdošíjně mladík. \r\n"Tak dobře, pomodlete se 5x Otčenáš a 4x Zdravásmaria a bude ti odpuštěno, synu."\r\nMladík vyjde před kostel a potká kamaráda, který se ho ptá:\r\n"Jak jsi dopadl?"\r\n"Dobře, obdržel jsem 5x Otčenáš, 4x Zdrávasmaria a tři dobré tipy!"', 803, 3.29, 31),
	(6625, 'Pani katechétka na náboženstve sa pýta žiakov:\r\n- Deti, je to malé, chlpaté, hnedé, behá to po stromoch a ľúbi to oriešky. Čo je to?\r\nNikto sa neprihlási, tak pani katechétka sa opýta Janka. Janko vraví:\r\n- Pani katechétka, normálne by som odpovedal, že je to veverička, ale ako vás poznám, je to určite Ježiš!', 336, 3.58, 31),
	(6626, 'Viete prečo Pán Boh stvoril ženu?\r\nPretože Adama veľmi bolela ruka.', 72, 3.11, 31),
	(6627, 'Tri manželské páry majú záujem vstúpiť do ortodoxnej sekty, kde podmienkou pre vstup je štrnásťdenná sexuálna abstinencia. Prídu na prijímací pohovor a vrchný starší sa ich pýta, či dodržali túto podmienku. Prvý manžel odpovedá: \r\n- Iste, bez problémou. Naša viera je silnejšia než pudy.\r\nDruhý manžel odpovedá: \r\n- No druhý týždeň som si musel ísť ľahnúť na gauč v obývačke, ale vydržali sme.\r\nTretí manžel v rozpakoch vraví: \r\n- Zo začiatku to išlo, ale potom sa manželka načiahla na policu pre plechovku s fazuľou, tá jej spadla a ako sa pre ňu zohla, tak som sa neovládol...\r\n- No, ale to k nám nemôžete!\r\n- Ja som to tušil. My koniec koncov od tej doby nesmieme ísť ani do TESCA.', 746, 3.35, 31),
	(6628, 'Viete aké je najstaršie remeslo na svete?\r\nElektrikár!!! \r\nLebo keď Boh povedal "Budiš svetlo", elektrikári už mali naťahané káble.', 141, 3.39, 31),
	(6629, 'Príde mladé dievča do spovednice a spovedá sa farárovi:\r\n- Otče, zhrešila som.\r\nA farár na to:\r\n- Ja viem, ale nám s kostolníkom sa to veľmi páčilo.', 161, 3.07, 31),
	(6630, 'Jano sa dostane po smrti do pekla. Na vchode ho čaká satanáš, že ho prevedie po pekle. Ukazuje mu miestnosti vraviac:\r\n- Tu môžeš jesť do sýtosti...  tu môžeš piť čo chceš a koľko chceš... tu sú pekné dievčatá.\r\n- A čo je v tamtých dverách? - pýta sa Jano.\r\n- Nič, tam nemusíme ísť.\r\nJano však na tom trvá a tak mu satanáš otvorí dvere. Tam sa v kotloch varia ľudské končatiny, čerti bičujú ľudí... \r\nJano sa pýta:\r\n- A toto je čo?\r\n- Toho sa nemusíš báť, toto tu chceli kresťania...', 533, 3.96, 31),
	(6631, 'Boh, Alah a Budha sa nudia a rozmýšľajú, čo budú robiť. \r\nBoh: - Poďme na Merkúr!\r\nAlah: - To je blbosť, tam sú metánové dažde a agresívna atmosféra. Robí mi to zle na moju pleť. Tam nejdem, ale poďme na Mars!\r\nBudha: - Tam zasa nejdem ja! Nie je tam vzduch ani voda a viete, že ja som vždy smädný. Ale poďme na Zem!\r\nBoh: - No určite! Tam som bol pred 2000 rokmi! Mal som tam pomer s jednou židovkou a dodnes tam o tom ľudia rozprávajú!', 466, 3.35, 31),
	(6632, 'Viete, aké je to kláštorné tajomstvo?\r\nVíno?\r\nNie! Robertko pod matracom.', 78, 3.18, 31),
	(6633, 'Kamiónista vojde do krčmy a pýta sa krčmára:\r\n"Koho bol ten čierny pes s bielym obojkom?"\r\nKrčmár pozrie z okna von a vraví:\r\n"To bol náš farár čo hľadal kontaktnú šošovku!"', 190, 3.14, 31),
	(6634, 'Prvý let v najmodernejšom lietadle sveta:\r\nPo polhodine letu:\r\n- Veža, horí nám motor. Čo máme robiť?\r\n- Stlačte žltý gombík.\r\nPo ďalšej polhodine letu:\r\n- Veža, horí nám druhý motor. Čo máme robiť?\r\n- Stlačte červený gombík.\r\nPo ďalšej polhodine letu:\r\n- Veža, horia nám obidva motory. Čo máme robiť?\r\n- Opakujte po nás: Otče náš, ktorý si na nebesiach...', 393, 3.2, 31),
	(6635, 'Kňaz a rabín viedli kostolík a synagógu ne jednej ulici oproti sebe. Pretože mali rovnaký časový plán, rozhodli sa, že si spoločne kúpia auto. Po kúpe ho zaparkovali medzi svojimi pracoviskami. Za chvíľu rabín vykukol von a vidí, ako kňaz kropí auto vodou. Pretože bolo nové a ešte ho nebolo treba umývať, šiel sa spýtať, prečo to robí.\r\n- Požehnávam ho svätenou vodou.\r\nRabín chvíľku váhal, potom rýchlo vošiel do synagógy, za moment vyšiel von s pílkou, došiel ku kufru auta a odrezal tri centimetre z výfuku.', 554, 3.28, 31),
	(6636, 'Idú tri mníšky na aute a dojde im benzín. V diaľke zbadali benzínovú pumpu, ale chýba im nádoba. Tak prehľadajú celé auto a nájdu nočník.\r\nTak dôjdu na pumpu natankujú do nočníka a idú naspäť. Ako tak lejú ten benzín, ide okolo farár a kuká na ne, zakrúti hlavou a povie:\r\n"No mníšky, vašu vieru tak mať."', 336, 3.41, 31),
	(6637, 'V dedine sa strašne hádajú farár a rabín. Trvá to už niekoľko rokov, keď sa vo farárovi ozve svedomie a v rámci ekumenizmu sa chce s rabínom zmieriť. Tak raz, keď nie je rabín doma, rozhodne sa, že mu umyje auto. Rabín sa práve vracia domov a keď vidí, čo robí farár, rozbehne sa domov pre pílku a začne z farárovho auta odpilovať výfuk. Keď to farár zbadá hneď sa pýta, čo to preboha robí. Naštvaný rabín hovorí:\r\n- Keď ty moje krstíš, tak ja tvoje obrežem!!!', 503, 3, 31),
	(6638, 'Príde skupinka židovských obchodníkov a krčmárov pred nebeskú bránu, zaklopú a keď im otvorí svätý Peter a pýta sa čo by radi, odpovedia:\r\n- Šalom, prišli sme, lebo mladý pán nám je ešte dlžný za Poslednú večeru.', 237, 3.26, 31),
	(6639, 'Viete prečo Boh miluje ateistov? \r\nNeobťažujú ho svojimi problémami.', 73, 3.35, 31),
	(6640, 'Chlapec stretol mníšku a chcel sa jej opýtať koľko je hodín. Nevedel ako ju osloviť, tak sa pýta:\r\n- Pán farár-samička, neviete náhodou koľko je hodín?', 165, 3.08, 31),
	(6641, 'Zbožný farmář mající hospodářství, ženu a děti spokojeně žije na svém pozemku nedaleko Jerusalema. Jednoho dne se však kolem přežene ošklivá epidemie a jeho manželka zemře. Farmář se pomodlí a hospodaří dál. Netrvá však dlouho a jeho děti umírají na černý kašel. Ani teď však neztrácí dobrý muž svou víru a smiřuje se s osudem. Proto když se přižene velká voda a zničí mu celé hospodářství, zbalí si zbytek svých věcí do uzlíku, naloží je na osla a vydává se na cestu. Nedostane se však daleko, když pojednou z čistého nebe sjede blesk a zabije mu osla. To už muž nevydrží, padá na kolena a křičí: \r\n- Pane Bože, co jsem Ti udělal, že mne tak trestáš?\r\nA shora se ozve: \r\n- Ale, nějak mě sereš nebo co.', 784, 3.54, 31),
	(6642, 'Farář v kostele při obřadu mává kadidlem. Z páté řady se ozve: \r\n- Bacha, brouku, hoří ti kabelečka!', 112, 3.39, 31),
	(6643, 'Mladý muž unavený mestským životom sa usadil v malej dedinke. Kúpil si zanedbaný pozemok, postavil na ňom dom a pred ním vytvoril prekrásnu záhradu. Navštívil ho dedinský farár a hovorí mu:\r\n- Blahoželám vám, Pán Boh a vy ste tu vykonali dobrý kus práce.\r\n- No viete, pán farár, mali ste sa sem prísť pozrieť vtedy, keď tu Pán Boh hospodáril sám.', 377, 3.32, 31),
	(6644, 'Čo sa stane, ak vybuchne kúrenie v kláštore?\r\nVychladnú nám teplé mníšky.', 82, 3.08, 31),
	(6645, 'Mojžiš, Ježiš a chlap v károvanom saku hrajú golf. Mojžiš si položí loptičku a odpáli. Loptička spadne do vody. Voda sa rozostúpi, Mojžiš odpáli a loptička spadne do jamky. Ježiš obstojí takisto. Na rade je chlap v károvanom saku. Odpáli, loptička spadne do vody. Z vody vyskočí ryba s loptičkou v papuli. Chytí ju orol a odnesie ju nad jamku. Ryba pustí loptičku a tá spadne do jamky. A Ježiš hovorí: \r\n- Otec, ideme hrať alebo sa ideš predvádzať?', 486, 3.46, 31),
	(6646, 'Starého Žida prejde pred kostolom auto. Vybehne kňaz, prikľakne si k nemu a \r\npošepká mu do ucha:\r\n- Synu, veríš v Boha Otca, Syna a Ducha svätého?\r\nŽid otvorí oči:\r\n- No nie, ja umieram a on mi tu dáva hádanky!', 226, 3.47, 31),
	(6647, 'Ježiš sa prechádza po lese a stretne staršieho muža:\r\nJežiš: \r\n- Dobrý deň.\r\nMuž: \r\n- Dobrý deň. Čo tu robíte?\r\n- Hľadám tu svojho otca.\r\n- Ja tu hľadám svojho syna.\r\n- Môj otec je tesár.\r\n- Aj ja som tesár.\r\n- Ale môj otec je chudobný.\r\n- Aj ja som chudobný.\r\n- Môj otec sa volá Jozef.\r\n- Aj ja sa volám Jozef!\r\n- Otecko!!!\r\n- Pinocchio!!!', 367, 3.62, 31),
	(6648, 'Farár sa sťažuje biskupovi: \r\n- Pán biskup, ľudia mi zaspávajú pri kázaní. Poraďte mi, prosím.\r\nBiskup mu hovorí: \r\n- No musíš ich nejako zaujať. Napríklad. Ľudia, zamiloval som sa...... do Panny Márie. Chápeš?\r\nV nedeľu na omši začne farár kázať. \r\n- Ľudia, biskup sa zamiloval..... len si nemôžem spomenúť na meno tej ženy.', 357, 3.25, 31),
	(6649, 'Ježiš sa prechádza po Izraeli, príde k jednej chatrči, pred ktorou sa hrá malý chlapec. Ježiš sa mu prihovára:\r\n- Vieš, maličký, kto som ja? Ja som Ježiš Nazaretský, poznáš ma?\r\nChlapček sa na neho pozrie, otočí sa smerom k chatrči a kričí:\r\n- Tato, doneste klince, už je tu zas...', 306, 3.27, 31),
	(6650, 'Anča sa príde k farárovi spovedať a hovorí:\r\n"Bozkával ma chlapec."\r\nFarár sa pýta:\r\n"Bozkával ťa na ústa?"\r\n"Áno pán farár."\r\n"Bozkával ťa na krku?"\r\n"Áno pán farár."\r\n"Bozkával ťa na prsiach?"\r\n"Áno pán farár."\r\n"Bozkával ťa na brušku?"\r\n"Áno pán farár."\r\n"Bozkával ťa na kolenách?"\r\n"Áno pán farár, ale nepreskakujte."', 357, 3.46, 31),
	(6651, 'Prečo Ježiša Krista neutopili ale ho ukrižovali?\r\nKto by chcel mať nad dverami zavesené akvárium.', 104, 2.96, 31),
	(6652, 'Lekárovi sa stalo, že zhrešil so svojou pacientkou. Aby zahnal výčitky\r\nsvedomia, išiel sa do kostola vyspovedať:\r\n"Panebože, odpusť mi nehodnému, zhrešil som so svojou pacientkou."\r\nZ neba sa ozval hlas:\r\n"Veď to nie je nič strašného, stáva sa, že človek urobí chybný krok a lekár je tiež len človek."\r\n"Ale ja som porušil lekársku etiku! Je to strašný hriech! Odpusť mi to prosím."\r\nHlas z neba:\r\n"Máš odpustené lekárov je hodne a aj iným sa stáva, že občas zhrešia."\r\nA potom dodá zamyslene:\r\n"Aj keď je pravdou, že nie všetci sú veterinári."', 589, 3.06, 31),
	(6653, 'Ježiš zmenil vás život.\r\nChcete uložiť zmeny?', 51, 3.61, 31),
	(6654, 'Boh stvoril zviera a povedal:\r\n- Hmm, pekné.\r\nPotom stvoril muža a povedal:\r\n- Hmm, pekné.\r\nA nakoniec stvoril ženu a povedal:\r\n- Hmm, domaľuje sa.', 152, 3.11, 31),
	(6655, 'Telefonuje Saddám Hussajn Clintonovi:\r\n"Mal som taký sen. Išiel som v roku 2005 po New Yorku a všade boli povešané nejaké plagáty.\r\n"Čo na nich bolo?"\r\n"Veľký nápis: Allah akbar."\r\n"Ja som tiež mal sen. Išiel som v roku 2000 po Bagdade a tiež na každom rohu boli plagáty s nejakým nápisom.\r\n"Čo na nich bolo napísané?"\r\n"A Boh vie? Nerozumiem hebrejčine."', 378, 3.12, 31),
	(6656, 'Ide Ježiš po púšti a hľadá svojho otca. Prejde pár dní a stretne starca. Pozdraví ho a vraví.\r\n- Hľadám tu svojho otca.\r\nStarec na to.\r\n- To je náhoda, ja hľadám svojho syna.\r\nJežiš:\r\n- Ale môj otec je stolár.\r\nStarec:\r\n- Aj ja som stolár.\r\nJežiš:\r\n- Ale môj otec je chudobný.\r\nStarec:\r\n- Aj ja som chudobný.\r\nJežiš:\r\n- Ale môj otec sa volá Jozef.\r\nStarec:\r\n- Aj ja sa volám Jozef.\r\nJežiš sa šťastne hodí starcovi do náručia a skríkne:\r\n- Otec!\r\nStarce tiež radostne vykríkne:\r\n- Pinokio!', 528, 3.4, 31),
	(6657, 'Príde terorista z IRA pred nebeskú bránu. Keď už chce vstúpiť dnu, dobehne k nemu svätý Peter a hovorí mu: \r\n- Ale, ale Patrik! Ty si zabíjal ľudí a kládol bomby! Ty nemôžeš ísť sem.\r\n- Ja sem nechcem ísť. Len som vám prišiel povedať, že máte päť minút na evakuáciu.', 296, 3.55, 31),
	(6658, 'Tri mníšky idú na spoveď. Prvá príde k farárovi a hovorí:\r\n- Jáj pán farár, odpusťte, zhrešila som, videla som.\r\nFarár sa zhrozí a povie:\r\n- Ale sestra! Okamžite si choďte pretrieť oči svätenou vodou!\r\nPríde druhá a hovorí:\r\n- Jáj pán farár, odpusťte, zhrešila som, držala som.\r\nFarár sa zhrozí a povie:\r\n- Ale sestra! Okamžite si chodte umyť ruky svätenou vodou!\r\nTretia sa obáva farára, a tak sa najprv spýta oboch sestier, čo im povedal. Prvá jej teda povie, že si musela oči pretrieť svätenou vodou a druhá si v nej ruky musela umyť. Tretia mníška si vzdychne:\r\n- Ach, dievčatá, asi budem kloktať!', 651, 3.43, 31),
	(6659, 'Ako môžeš najlepšie pobaviť Boha?\r\nPorozprávaš mu svoje plány do budúcna.', 82, 3.64, 31),
	(6660, 'Mamička pošle svojho syna na spoveď. Keď príde synček domov s plačom opýta sa ho:\r\n- Prečo plačeš?\r\n- Pán Farár mi povedal, že keď prídem domov, mám sa pomodliť 5 krát Otčenáš, a ja viem iba jeden.', 219, 3.14, 31),
	(6661, 'Chlapík stojí na moste a chce skočiť. V tom k nemu príde druhý chlapík a vraví:\r\n- Nerobte to! Neskáčte! Veď je tu toľko vecí kvôli ktorím sa oplatí žiť.\r\n- Napríklad aké?\r\n- No ste veriaci alebo ateista?\r\n- Veriaci.\r\n- Katolík alebo Evanjelik?\r\n- Katolík.\r\n- Rímsko-katolík alebo Gréko-katolík?\r\n- Gréko-katolík.\r\n- Tak si skap ty špina pohanská!!!', 379, 2.83, 31),
	(6662, 'Štyri ženy - katolícky sa rozprávajú pri káve. Prvá svojim priateľkám hovorí:\r\n- Môj syn je kňazom. Keď vstúpi do miestnosti, každý ho volá "otče".\r\nDruhá hneď kontruje:\r\n- Môj syn je biskupom. Keď vstúpi do miestnosti, každý ho volá "vaša milosť".\r\nTretia sa nedá zahanbiť:\r\n- Môj syn je kardinálom! Keď on vstúpi do miestnosti, každý ho volá "vaša eminencia".\r\nŠtvrtá žena len tíško popíja kávu. Keď sa na ňu uprú tri zvedavé páry oči, nevydrží:\r\n- Môj syn je vysoký 190 cm. Má široké plecia a vyšportovanú svalnatú postavu. Má zmluvu s Chip\'n\'Dales a okrem toho dvakrát týždenne vystupuje v špeciálnom striptérskom klube pre ženy. Keď on vstúpi do miestnosti, ženy si povzdychnú: "ó, bože".', 768, 3.52, 31),
	(6663, 'Chlapík sa sprchuje a zrazu niekto vyzváňa. Vyjde z vane a pýta sa.\r\n- Kto je?\r\n- To sme my, jehovovy svedkovia!\r\n- Čo chcete?\r\n- Chceme sa rozprávať.\r\n- Koľký ste?\r\n- Dvaja.\r\n- Tak sa rozprávajte!', 207, 3.57, 31),
	(6664, 'Stretávaju sa dvaja farári zo susedných obcí každý deň na bicykloch, keď v jeden deň ide jeden pešo.\r\n- Čo sa stalo, že idete pešo?. \r\n- Ále, veriaci mi ukradli bicykel!!\r\n- Ja Vám poradím, zajtra na omši, keď budete hovoriť desať prikázaní a budete pri nepokradneš, zapozerajte sa veriacím priamo do oči a ktorý uhne pohľadom, tak to bol on.\r\nO dva dni sa stretnú a obaja na bicykloch.\r\n- Vydím, že moja rada pomohla.\r\n- Áno, keď som bol pri nezosmilniš, tak som si hneď spomenul, kde som ho ja zabudol.', 538, 3.69, 31),
	(6665, 'Farár ide na WC a nachytá tam mladíka ako onanuje. Hovorí mu: \r\n- To by si nemal robiť, to by si si mal odložiť až do svadby.\r\n- Áno, otče.\r\nPo 10 rokoch príde chlapík za farárom a hovorí:\r\n- Pán farár, asi si ma nebudete pamätať, ale pred desiatimi rokmi ste ma načapali pri onanovaní a radili ste mi, aby som si to nechal až do manželstva.\r\n- Áno to som mohol povedať... A riadil si sa podľa toho?\r\n- Áno, len mám taky problém. Oženil som sa a mám toho odloženého 50 litrov a neviem čo s tým...', 530, 3.36, 31),
	(6666, 'Cigáň sa spovedá:\r\n- Pán farár, ukradol som jedno vreco cementu a nie, nie, dva.\r\n- Tak jedno alebo dva?\r\n- Jedno, ale jedno mi ešte treba.', 145, 3.12, 31),
	(6667, 'Svätý otec bude mať čoskoro meniny.\r\nBude druhého.', 55, 3.12, 31),
	(6668, 'Viete, ktoré víno je najlepšie?\r\nOmšové. Jeden pije a všetci spievajú. ', 78, 3.27, 31),
	(6669, 'Farár s kantorom sa chvália ktorý z nich pretiahol viac žien. Sú to veľkí vystatovači a preto sa dohodnú, že na druhý deň budú čakať pred omšou svoje ovečky a pri každej žene, ktorú pretiahle povedia "Hop". Na druhý deň ráno sa ženičky valia do kostola. Vojde prvá, farár "hop" a kantor tiež "hop". pri druhej a tretej takisto. Zrazu sa vo dverách objaví farárova žena s oboma dcérami. Farár víťazoslavne žmurkne na kantora: "Hop", ten však pohotovo zakontruje: "Hop, hop, hop".', 516, 3.99, 31),
	(6670, 'Hovorí mladá slečna kňazovi:\r\n- Velebný pán, čo robí vaša ruka na mojej sukni?\r\n- O dcéra, prepáč, zmýlil som si ťa s miništrantom.', 146, 3.38, 31),
	(6671, 'Na náboženstve dáva katechétka deťom hádanku.\r\n- Je to chlpaté, skáče to po stromoch a žerie to oriešky. Čo je to?\r\nPrihlási sa Ferko a hovorí.\r\n- Ja si myslím že je to veverička ale ako vás poznám tak to bude určite Ježiš Kristus ', 253, 3.96, 31),
	(6672, 'Prečo Ježiša Krista neutopili, ale ukrižovali?\r\nKto by chcel mať na dverách akvárium?', 92, 3.14, 31),
	(6673, 'Viete aký je rozdiel medzi bibliou a trenírkami???\r\n- čo nestojí v biblií stojí v trenírkach', 99, 3.95, 31),
	(6674, 'Nový farár bol pri svojej prvej kázni tak nervózny, že takmer ani\r\nnedokázal prehovoriť. Ďalšiu nedeľu, pred druhou kázňou, sa\r\nspýtal prítomného arcibiskupa, že čo by mal urobiť, aby sa uvoľnil. Ten mu\r\nporadil: "Kvapnite si do vody trochu vodky, uvidíte, že po\r\nniekoľkých\r\nhltoch budete trochu kľudnejší."\r\nFarár poslúchol radu a skutočne, cítil sa tak výborne, že by\r\ndokázal\r\nrečniť aj vo víchrici, úplne kľudne. Po bohoslužbe sa vrátil do\r\nsakristie, kde našiel lístok od arcibiskupa, ktorý mu odkazoval:\r\n\nVážený Otče:\r\n\nNabudúce si nalejte vodku do vody, nie vodu do vodky. V ďalšom\r\npripájam niekoľko poznámok, aby sa už neopakovalo to, čo som videl\r\nna\r\ndnešnej omši:\r\n- Na okraj kalicha nie je nutné dávať koliesko citróna.\r\n- Tie kabínky v bočnej lodi sú spovednice, nie toalety.\r\n- Snažte sa neopierať o obraz Panny Márie, a už vôbec ju nemusíte\r\nobjímať a bozkávať.\r\n- Máme 10 prikázaní, nie 12.\r\n- Apoštolov bolo 12, nie 7, a žiadny z nich nebol trpaslík.\r\n- Našeho Pána Ježíša Krista a Jeho Apoštolov nenazývame "JC &\r\nHis\r\nBoys".\r\n- Dávid porazil Goliáša prakom a kameňom, nie je pravda, že by\r\nho\r\n"dojebal".\r\n- Judáša neoznačujeme za "zkurveného zmrda".\r\n- Svätého Otca sa nepatrí prezývať "Papa Ratzi".\r\n- Bin Ládin nemal nič dočinenia s Ježíšovou smrťou.\r\n- Svätená voda je na požehnanie, nie na osviežovanie zátylku.\r\n- Nikdy sa nemodlite sediac na schodíkoch pred oltárom.\r\n- Hostie sa majú rozdať veriacim, nemajú sa prikusavať k vínu.\r\n- Veriaci hádžu príspevky do pokladničky dobrovoľne; odstráňte\r\nnápis: "Vaše sprepitné je môj plat".\r\n- Hriešnici pôjdu do pekla, nie "do piče".\r\n- Pri otčenáši je možné dvíhať ruky k nebesiam, ale nie sa\r\nkývať do vlny.\r\n- Vašu iniciatívu, aby si všetci prítomní zatancovali, hodnotím\r\nkladne,\r\nale robiť vláčik po celom kostole, to NIE!\r\nDôLEžITé: Ten, čo sedel v kúte pri oltári, a o ktorom ste\r\ntvrdili, že\r\nto je "buzík v sukni" a "transvestita bez make-upu", to som bol ja.\r\nDúfam, že do budúcej nedele tieto nedostatky napravíte. Inak, na\r\nprvú\r\nkázeň to bolo celkom dobré.\r\n\nS pozdravom,\r\n\nArcibiskup', 2237, 4.25, 31),
	(6675, 'Moricko vypomáha u farára a ten mu nakáže, aby išiel na poschodie a doniesol mu papuče. Tam stretne Moricko farárove dve dcéry a hovori im:\r\n"Váš otec mi nakázal, aby som vás pretiahol."\r\n"Neverime",\r\n"Neveríte, tak sa ho opýtame. Pán farár obi dve?"\r\nTen odpovedá: "Samozrejme že obi dve."', 308, 3.87, 31),
	(6676, 'Na Veľký piatok dobehne chlapík ku krížu a hovorí, Ježiš pomôž mi, každý mi hovorí že som somár. Tak mu na to Ježiš riekol, zves ma z kríža a ja Ti zaručím, že do konca života Ti nikto nebude nadávať. Chlapík okamžite vytiahol dva klince, vtom sa ozve hromový hlas,, Najskôr nohy Ty somár !,,', 322, 3.64, 31),
	(6677, 'Ide farár s motorkárom na motorke a zrazu spadnú. Motorkár povie: Do riti! - farár sa nahnevá a povie: Druhy krát povedz nejaké zvieratko. Tak idú 200 až 300m a spadnú. Motorkár povie: Had, had, had! A farár: Do riti, kde?', 235, 4.11, 31),
	(6678, 'Ide oco so synom a syn ide s fúrikom do kostola požiadať farára o kilo zemiakov. Farár na to ak chcete zemiaky musíte sa pomodliť. Otec povie na konci modlidby v mene otca i ducha svätého. A kde ste vynechali syna a otec hovorí čaká s fúrikom pred kostolom.', 270, 3.23, 31),
	(6679, 'Vo vlaku sedí mníška a pri nej sedí chlap.\r\nChlap sa jej pýta:\r\n-Mníška môžem Ťa pomilovať???\r\nOna nato:\r\n-nie lebo nám každý deň kontrolujú p.blanu!\r\nA on nato:\r\n-A  do riti????\r\nMníška súhlasila...\r\nPo dlhšom milovaní sa ho mníška pýta:\r\n-mate rodinu?\r\nOn jej odpovie:\r\n-nie!\r\nMilujú sa ďalej.....muž to už nevydrží a vraví mníške:\r\n-oklamal som Vás ja mam rodinu a mám aj deti.\r\nMníška nato:\r\n-aj ja sa musím priznať!vJa nie som mníška som chlap a práve idem s karnevalu!!!...........', 529, 3.8, 31),
	(6680, 'Pane vy ste taký pekný, že sa mi chce vracať.', 49, 3.37, 31),
	(6681, 'Príde mníška do obchodu a chce si kúpiť fľašku rumu. Predavač jej vraví:  "Ale sestra, vy by ste predsa nemala piť alkohol."\r\nMníška: "To nie je pre mňa, to je pre pána farára ako preháňadlo. "\r\nPredavač jej fľašku predá a mníška odíde. Asi za pol hodiny jňide predavač zavrieť obchod, vyjde von, aby stiahol roletu a vidí mníšku ako sa váľa pred obchodom opitá na zemi a vedľa nej je prázdna fľaška od rumu. Predavač sa vydesí: "Ale sestra, veď ste predsa vraveli, že to je pre pána farára ako preháňadlo."\r\nMníška odpovie: "Až ma pán farár uvidí, tak sa z toho poserie!"', 623, 4.2, 31),
	(6682, '"- Viete čo je najväčšia naivita?"\r\n"- Keď mníška pracuje v továrni na kondómy a myslí si, že vyrába spacáčiky pre myši."', 136, 3.83, 31),
	(6683, 'Chlapík hodí do mníšky idúcej na bicykli vidly a zvolá:\r\n"- Mám ťa Batman!"', 83, 3.7, 31),
	(6684, 'Chlapík príde za farárom a povie mu: "Pán farár, pochovajte mi psa. Zrazilo ho auto."\r\nFarár mu hovorí: Kdeže ja? To neexistuje.\r\nChlapík: Ale veď ja vám za to dám 5000 Sk.\r\nFarár: Jáááj, tak to ste mali hneď povedať, že váš psíček bol veriaci.\r\n', 269, 3.74, 31),
	(6685, 'Príde pán s mŕtvym psom v náručí za farárom a spýta sa ho či by mu ho nepochoval.\r\n"To predsa nejde, my robíme obrady iba pre ľudí"\r\n"Ale pán farár, to bol môj najlepší priateľ, rodinný príslušník, nedalo by sa to nejako urobiť?"\r\nFarár hovorí: "Nie, ale na druhom konci dediny, v tom statku žije taká sekta, tí Vám ho určite pochovajú."\r\nPán sa spýta: "A myslíte, že im bude stačiť 10.000,- Sk?"\r\n"Áaale, a prečo ste to nepovedal hneď, že psíček bol katolík?"', 504, 4.02, 31),
	(6686, 'Cigáň v obchode nakupuje. Pri pulte vidí krížik zo zlatým Ježišom a pýta sa: "Koľko stojí ten krížik?" Predavačka odpovedá:"1500 korún".A cigáň na to: "A bez toho atléta???"', 192, 4.03, 31),
	(6687, 'Kedysi sa po jednom meste rozniesla správa, že si mníšky spravili z kláštora verejný dom. A vraj veľmi lacný.\r\nJeden chlapík neodolal a išiel sa tam pozrieť. Pri vchode ho privítala jedna z mníšok. Chlapík sa jej pýta:\r\n"Dobrý deň, počul som, že tu máte vraj lacný bordel? Je to pravda?"\r\nMníška na to: "Áno, poďte ďalej. Cena je iba 100,- Sk."\r\n"Á - to je naozaj veľmi lacné!" - odpovedá chlapík.\r\nZaplatí a mníška mu hovorí: "Teraz bežte touto chodbou rovno, potom doľava. Prídete ku dverám a vstúpte dnu. Potom to je už len na vás..."\r\nChlapík prebehne chodbou podľa návodu mníšky, uvidí dvere, vojde, zatvorí ich za sebou - a je späť na ulici.\r\nOtočí sa a na dverách uvidí nápis:\r\n"DNES S VAMI VYDRBALA SESTRA MÁRIA..."', 782, 4.09, 31),
	(6688, 'Príde chlapík do neba, kde ho Peter ubytuje a donesie mu na obed jablkový jogurt.\r\nNa druhý deň, keď nadíde čas obeda, Peter zase donesie jogurt.\r\nPo týždni sa chlapík prejedený jogurtmi pýta Petra:"To nemáme nič iné???"\r\nPeter mu odpovedá:"Nooo, pre jedného sa neoplatí variť!"', 298, 3.06, 31),
	(6689, '"Istota je istota" - povedala mníška a natiahla kondóm na sviečku...', 72, 3.98, 31),
	(6690, 'Móricko chodí každoročne na Veľkú noc do kostola. Farár má kázeň o tom ako Ježiša zajali v Getsemanskej záhrade. Móricko to už nevydrží a na celý kostol zakričí: " Ta to chuj na čo tam šiel, veď aj vlani ho tam chytili?!"', 244, 3.8, 31),
	(6691, 'Pouličný predavač svätých obrázkov:\r\n" Kúpte si obrázky Boha, Krista, Máriu!"', 86, 4.14, 31),
	(6692, 'Viete prečo sa staré babky modlia, čítajú Bibliu a chodia do kostola?\r\nLebo sa drvia na záverečné skúšky.', 115, 3.87, 31),
	(6693, 'Stretli sa Slovák, cigáň, Japonec a súťažili kto preskočí kostol. Prvý skákal Slovák. Kostol nepreskočil, spadol na zem a vykríkol do pi... Vyšiel farár a povedal: "Chlapci, to prečo hrešíte?"Druhý išiel cigáň. Kostol nepreskočil, spadol na vežu kostola a vykríkol do pi... Farár vyšiel z kostola a hovorí: "Chlapci, to prečo hrešíte?"Tretí išiel japonec. Rozbehol sa a kostol preskočil. Farár vyšiel z kostola a hovorí: "Do pi... to čo." ', 477, 3.92, 31),
	(6694, 'Dohodnú sa Čech, Maďar a Slovák, že kto z nich preskočí kostol. Prvý ide Čech, nepreskočí a vraví: "Do riti, ja som to nepreskočil."Otvorí farár dvere a vraví: "Také škaredé slová by sa nemali hovoriť."Ide Maďar, tiež nepreskočí a vraví: "Do riti, ja som to nepreskočil."Otvorí farár dvere a vraví: "Také škaredé slová by sa nemali hovoriť."Ide Slovák a preskočí.Otvori farár dvere a hovorí: "Do riti, on to preskočil." ', 461, 3.77, 31),
	(6695, 'Idu rómovia krstiť dieťa a pýtajú sa farára, že čo si majú doniesť. Farár im hovorí, že sviečku.Na druhý deň prídu do kostola a farár sa ich pýta: "A dzecko ste nechali kdze?"A rómovia: "Šak dzecko sce nam nekázali prines."', 245, 4.11, 31),
	(6696, 'Viete prečo boh stvoril ženu?\r\n.....\r\nLebo Adama už bolela ruka.', 67, 3.95, 31),
	(6697, 'Na svätopeterskom námestí stretol Slovák Slováka s kyticou ruží a pýta sa ho, na čo má tú kyticu.\r\n"Idem vinšovať pápežovi."Netáraj, veď dnes nie je Benedikta.""To nie, ale je šestnásteho."', 208, 3.3, 31),
	(6698, 'Príde Pápež k nebeskej bráne a chce ďalej, ale svätý Peter ho nemôže v kartotéke nájsť. Pod P ako Pápež žiadny záznam, pod J ako Jan Pavel II. tiež žiadny záznam, pod W ako Wojtyla tiež nič.- "Ale vy ma musíte pustiť", rozčuľuje sa pápež, "ja som hlava Katolíckej cirkvi."- "Čo? To vôbec neviem čo je... nejaká cirkev... To som nikdy nepočul...."- "Tak sa bežte spýtať Boha, prosím vás......" prosí pápež. Ale Boh tiež nič nevie. Tak sa ide spýtať Ježiša, ten toho vie tiež veľa. Tak si ide Ježiš pohovoriť s pápežom a za chvíľu dôjde za Bohom a hrozne sa smeje: - "Tati, vieš ako som mal pred 2000 rokmi ten rybársky klub? Tak si predstav, že ešte funguje!"', 719, 3.44, 31),
	(6699, 'Ježiš je zhrozený z drog na celom svete. Pošle teda Matúša, Judáša a Tomáša, aby priniesli vzorky z rôznych kútov sveta, aby vedel ako na tom je svet s drogami. Matúš sa vráti zo sveta, príde za Ježišom a ten sa ho pýta: “Čo si mi doniesol?“ Matúš vraví: „Mariuhanu z Canady.“ Zaklope Tomáš a Ježiš sa ho tiež pýta: „Čo si mi priniesol?“ “Canabis z Južnej Afriky.“ A zaklope Judáš a Ježiš sa ho pýta: „Čo si mi doniesol ty?“  „FBI protidrogové .“', 508, 3.88, 31),
	(6700, 'Viete, aký je rozdiel medzi akné a farárom? Akné sa neurobí na tvári osemročného chlapca.', 97, 3.82, 31),
	(6701, '- Viete kedy je žena najpobožnejšia?- Keď leží na krížoch a prijíma telo pánovo.', 90, 4, 31),
	(6702, 'V írskom katolíckom Dubline plače malý 8 ročný chlapec. Okoloidúci sa ho pýta:\r\n- Prečo plačeš synak?\r\n- Ále, zomrela mi dnes mama.\r\n- To je strašné... Ak chceš, tak pôjdem ihneď s tebou za duchovným otcom O`Reilym. \r\n- Ďakujem Vám pekne pane, ale sex je posledná vec, na ktorú mám práve teraz chuť...', 326, 4.22, 31),
	(6703, 'Na začiatku roka si Pán Boh musel vypočut  mnohé prosby, želania, modlitby:\r\nDaj mi, prosím ťa lásku, aby  som mohla odpustiť manželovi,\r\nDaj mi, prosím ťa, trpezlivosť, aby som mohla zniesť manželove nálady,\r\nLen mi, prosím ťa, nedávaj silu, lebo ho zabijem...\r\n', 282, 4.18, 31),
	(6704, 'Viete čo je najväčšie vzrušenie pre farára?  Pretiahnuť omšu.', 69, 4.14, 31),
	(6705, 'Sedí kňaz v spovedelnici a počúva:\r"Otče, mám 80 rokov a už 50 rokov som ženatý. Celý život som bol manželke verný, až do včera. Včera som sa celú noc miloval s 18-ročnými dvojičkami."\r"A kedy ste boli naposledy na spovedi, dedko?"\r"Ja? Nikdy! Ja som žid."\r"Tak potom prečo mi tu hovoríte hriechy?"\r"Viete, ja sa dnes chválim každému..."', 363, 4.2, 31),
	(6706, '- Viete čo je najväčšie vzrušenie pre farára?\r- Pretiahnuť omšu.', 72, 4.05, 31),
	(6707, 'Farár sa sťažuje:\r- "Kostol je prázdny, niet tu ani človiečika, ani organista neprišiel. Kto dnes bude hrať?"\r- "Švédsko s Kanadou," hovorí miništrant.\r', 164, 3.92, 31),
	(6708, 'Ide muž pred kláštoro a na dverách je napísané: ,,Sex s mníškou za 100 €\'\'. \r\nMuž neváha, príde ku mníške a dá jej peniaze. Mníška mu vraví: ,,Prejdite touto chodbou, na konci sú veľké dvere a tam vojdite.\'\'\r\nMuž ide, príde k dverám, otvorí, vojde a v tom sa ocitne na ulici. Na dverách je napísané: ,,Dnes s vami vyj*bala sestra Mária!!!\'\'', 370, 4.29, 31),
	(6709, 'Ide farár s kadidlom okolo kostola a cigáň naňho kričí:\r\n- "Hej ty buzna, horí ti kabelka."', 98, 4.16, 31),
	(6710, 'Přijde se podívat svatý Petr do pekla a vidí všude mrtvoly čertů, kotle rozbité, stěny rozřezané... hledá tedy Satana, až ho najde, jak se klepe za jedním z kotlů.\r\n"Co se tady děje?" ptá se ho. Satan se nejdřív vyděšeně rozhlédne kolem a pak potichu spustí: "Před dvěma dny k nám přišel jeden doomař a hned vytáhl pilu a začal tady všechno ničit a zabíjet. V celém pekle je už jen pár čertů, nemůžeš si ho radši vzít do nebe?"\r\nSvatý Petr se smiluje a luskne prsty. Doomař je tedy najednou v nebi. Rozhlíží se, všude obláčky, klid mír, děti si hrají, andělé poletují sem a tam. Chvíli zasmušile sleduje tu krásu, pak se však usměje, nastartuje pilu a zařve: "Bonus level!"', 738, 3.97, 31),
	(6711, 'Chlapíka zrazí kamión, ťažká rana, plno krvi, príde sanitka a rýchlo do špitálu. Vec je jasná - amputácia nohy. Na druhý deň príde lekár na kontrolu, zdvihne plachtu, zahmká a hovorí pacientovi:\r\n- Mám pre vás dve správy. Dobrú a zlú. Tá zlá je tá, že sme vám odrezali zdravú nohu. Ale tou dobrou správou je fakt, že tá zránená sa vám rýchlo a dobre hojí...', 394, 3.52, 32),
	(6712, 'Čo je lepšie? Parkinsonova alebo Alzheimerova choroba? \r\nTo je jedno, či to pivo rozlejte alebo zabudnete, kde ste ho položili.', 131, 3.11, 32),
	(6713, 'Blondínka príde k doktorovi a on jej nahmatá dve chrbtice. A tak blondínka zájde na rentgen. Keď sa vráti, dá snímku doktorovi a spýta sa. \r\n- Pán doktor, sú to naozaj dve chrbtice?\r\n- Mne sa zda, že nie, ale musím sa vás niečo spýtať. Vyberáte si vôbec tampóny?', 283, 3.37, 32),
	(6714, 'V nemocnici sa hosťujúci medici zúčastňujú na vizite. V prvej izbe vidia chlapa ako onanuje na posteli a pýtajú sa na jeho diagnózu. \r\n"Tento pacient má neukojitelnú chuť po sexe, preto musí každé 4 hodiny onanovať..."\r\nPrídu do ďalšej izby a vidia iného pacienta, ako mu sestrička robí orál. \r\n"A tomuto je čo?" \r\n"Tento má rovnakú diagnózu ako ten predošlý, iba má lepšiu posťovňu..."', 419, 3.48, 32),
	(6715, 'Pán doktor, prečo si nemôžem nahmatať nohy?\r\nPreto, lebo sme vám amputovali ruky!', 87, 3.47, 32),
	(6717, 'Príde žena do spermobanky a chce sa dať umelo oplodniť genetickým materiálom známej osobnosti.\r\nLekár sa jej pýta: \r\n"A koho spermie by ste si tak želali? V našom katalogu máme široký výber hercov, spevákov, ..."\r\nOna na to: \r\n"Strašne rada by som mala dieťa od Delona."\r\nLekár odpovedá  s úsmevom: \r\n"Žiaden problém slečna, teraz vám pichnem sedatíva  a prikročíme k zákroku."\r\nŽena súhlasí. Po krátkej chvíly, keď sa prejavili účinky injekcie si lekár stiahol nohavice a uškrnul sa:\r\n"Ja ti dám Delona..."', 547, 3.29, 32),
	(6718, '- Pán doktor, som ešte panna. Čo mám robiť?\r\n- Ľahnite si na chrbát...', 77, 3.14, 32),
	(6719, 'Muž sa zobudí po narkóze v nemocnici a pýta sa doktora:\r\n- Pán doktor, ešte žijem?\r\n- Asi áno, hoci tie krídla sú podozrivé.', 135, 2.89, 32),
	(6720, 'Sestrička vojde do ordinácie a pýta sa doktora čo robí.\r\nDoktor na to:\r\n"Vypisujem recept!"\r\n"Ale veď máte v ruke teplomer!"\r\n"A kde, v ktorom zadku je moje pero?"', 170, 3.4, 32),
	(6721, '- Pán doktor je mi niečo.\r\n- To sa dozvieme po pitve.', 55, 3.01, 32),
	(6722, 'V nemocnici:\r\n"Sanitár, čo mi to sem vozíte?! Minule sa to bránilo pri pitve!"', 82, 3.51, 32),
	(6723, '92 ročný muž vojde do ordinácie, a hovorí lekárke. \r\n- Pani doktorka, nenainfikovali by ste ma AIDSom?\r\nLekárka si ho premeria a pýta sa. \r\n- Koľkože vy máte rokov?\r\n- Ja? 92 - hrdo odpovie dedo. \r\n- Vidíte, takého požehnaného veku ste sa dožili, a chcete sa dať nainfikovať AIDSom, viete vôbec, aká je to choroba, dedko?\r\n- Ale pravdaže. Veď v novinách som čítal, že s touto chorobou si ešte aj takých desať rokov môžem požiť.', 460, 3.12, 32),
	(6724, '- Pán doktor, môžem si aj v starobe užívať?\r\n- Áno, dedko, ale iba lieky.', 80, 3.43, 32),
	(6725, 'Hovorí lekár pacientovi:\r\n- Dnes užite dve tablety a ak sa ešte zajtra zobudíte, užite ďalšie dve.', 106, 3.32, 32),
	(6726, 'U psychiatra.\r\n- Ako sa voláte?\r\n- James Bond.\r\n- Zaujímavé. Minulý týždeň ste tvrdili, že sa voláte Merylyn Monroe.\r\n- Tak to je moje dievčenské meno.', 162, 2.92, 32),
	(6727, '- Haló? Je tam pohotovosť? Prosím vás, rýchlo niečo robte, lebo naša laborantka je v inom stave!\r\n- Len sa ukľudnite a zavezte ju k nám do pôrodnice.\r\n- Ale vy mi nerozumiete! Ona je v kvapalnom!', 205, 3.17, 32),
	(6728, 'Gynekológ sa počas ordinovania rozpráva s pacientkou, zrazu sa však čudne zatvári, prestane a hovorí:\r\n"Pani aby ste vedeli ja sa nezajakávam. To musi byť echo..."', 172, 3.16, 32),
	(6729, 'Príde chlap k urológovi a hovorí:\r\n- Prosím vás, potrebujem pomoc! Myslím si, že som nočná mora.\r\nA doktor mu na to: \r\n- Ale to musíte ísť k psychiatrovi. Prečo ste šli sem? \r\n- Lebo tu sa svietilo.', 212, 3.07, 32),
	(6730, '"Pán doktor, mal som hroznú nočnú moru. Snívalo sa mi, že celú noc som ťahal za dvere, na ktorých sa niečo písalo."\r\n"A čo sa tam písalo?"\r\n"TLAČTE!"', 163, 3.28, 32),
	(6731, 'Doktor:\r\n- Váš syn sa z tej choroby čo nevidieť dostane.\r\nRodič:\r\n- Prečo si to myslíte?\r\nDoktor:\r\n- Má už takú zdravú žltú farbu.', 143, 3.23, 32),
	(6732, 'Skonštatovanie lekára:\r\n"Buď je mŕtvy, alebo mám pokazený fonendoskop..."', 79, 3.47, 32),
	(6733, 'Psychiater vyšetruje pacienta. Zoberie papier, nakreslí čiaru a pýta sa ho:\r\n- Na čo myslíte?\r\n- Na holú ženu.\r\nPsychiater pokrúti hlavou, nakreslí kruh a pýta sa znova:\r\n- Na čo myslíte teraz?\r\n- Na holú ženu.\r\n- Vy ste posadnutý sexom! - hovorí doktor.\r\n- Prečo ja? Veď vy kreslíte tie oplzlosti.', 318, 4.19, 32),
	(6734, 'Príde žena ku gynekológovi,že má malé prsia. Doktor jej poradí, aby si každé ráno o 4.00 chytila prsia a spievala \'Rozvíjej se poupátko,rozvíjej...\', na druhý deň to isté...\r\nLenže jeden deň cestovala vo vlaku. V kupé spal chlap. Blíži sa 4.hodina a žena rozmýšľa,čo spraví. Ale nakoniec sa rozhodne dodržať radu lekára.\r\n"Rozvíjej se poupátko,..."\r\nA v tom sa zobudí chlap a vykríkne:\r\n"Čóó,to už sú 4 hodiny? Vysoký jalovec, vysoký jalovec,..."', 487, 3.62, 32),
	(6735, '- Pán doktor, pán doktor, rýchlo potrebujem okuliare... \r\n- No to vidím, toto je stánok s hranolkami!', 106, 3.27, 32),
	(6736, 'Aký je to gynekológ - labužník? \r\nTaký, ktorý si v práci olizuje prsty.', 78, 3.35, 32),
	(6737, 'Internista vyjde z ordinácie a v čakárni sedí staršia žena s veľmi peknou dcérou.\r\n"Nech sa páči slečna, poďte dovnútra a vyzlečte sa."\r\n"No viete, ja nie som chorá. To matka..."\r\n"Aha, tak pani, prosím otvorte ústa."', 234, 3.14, 32),
	(6738, 'Príde muž k lekárovi že ho boli v hrudi. Doktor ho popočúva a povie mu:\r\n- Mali by ste si dávať na hruď hlinu.\r\n- A to  pomáha?\r\n- Nie. To len preto, aby ste si už zvykali.', 183, 3.14, 32),
	(6739, '"Pozri sa, budem k tebe úprimný, musíš sa vzdať alkoholu", poučuje lekár svojho chorého priateľa.\r\n"Takže tak... Ja som hneď vedel doktorko, že som nevyliečteľný..."', 180, 3.52, 32),
	(6740, 'Dedko príde k lekárovi a hovorí:\r\n- Viete, u mňa to už nejako nejde a neviem čo s tým mám robiť.\r\nLekár na to: \r\n- Dedko, musíte veľa jesť a hlavne veľa pečiva.\r\nDedko hneď nato ide do pekárne:\r\n- Prosím si desať bochníkov chleba.\r\nPredavačka mu na to:\r\n- Dedko, prečo tak veľa? Veď vám stvrdne.\r\n- Veď o to mi práve ide, slečinka.', 359, 3.01, 32),
	(6741, 'Pýta sa lekár pacienta pred operáciou.\r\n- Ste poverčivý?\r\n- Nie, prečo?\r\n- Lebo od zajtra budete vstávať iba ľavou nohou.', 130, 3.04, 32),
	(6742, '"Tak čo, poslúchli ste môj pokyn a spávali ste pri otvorenom okne?"\r\n"Áno pán doktor."\r\n"A čo, zmizla tá bronchytída?"\r\n"Nie pán doktor, bronchytidu mám stále, ale zato mi zmizol televízor, mobil a rádio..."', 221, 3.08, 32),
	(6743, 'V nemocničnej čakárni sa prihovorí jeden muž druhému (koktavo):\r\n- Ah-hoj! J-j-ja m-mám p-prob-b-blémy s-s r-reč-čou. A č-č-o j-j-je t-tebe?\r\n- Prostata.\r\n- A t-t-to j-j-je č-č-o?\r\n- No... Vieš, keď ja čúram, tak to vyzerá asi tak, ako keď ty rozprávaš.', 275, 3.14, 32),
	(6744, 'Bavia sa dvaja chirurgovia. \r\n"Pán kolega, raz si tak operujem, operujem a naraz pozerám! Ja pitvem."', 103, 3.28, 32),
	(6745, 'Na úrazovej chirurgii sa starý ujo Ďuro preberá z narkózy. Keď lekár vidí ,že chorý otvoril oči, osloví ho:\r\n- Ujo, mám pre vás dve správy. Dobrú a zlú. Ktorou mám začať?\r\n- Začnite tou zlou.\r\n- Žial, museli sme vám amputovať obe nohy.\r\n- Bože dobrotivý, aká bude tá dobrá správa?\r\n- Mám kupca na vaše topánky.', 343, 3.63, 32),
	(6746, '- Jááj sestrička, či je hnusná tá medicína!\r\n- To nie je medicína, ale obed! ', 85, 3.53, 32),
	(6747, '- Aký výsledok mala vaša cesnaková dieta? - spytuje sa lekár pacienta.\r\n- Stratil som 8kg. A všetkých známych.', 118, 3.27, 32),
	(6748, '- Pán doktor, tie tabletky na spanie sú naozaj perfektné!\r\n- Tak čo vám ešte chýba?\r\n- Tabletky na prebudenie.', 117, 3.06, 32),
	(6749, 'Muž príde so svojou ženou k lekárovi, ten ju vyšetrí a hovorí mužovi:\r\n- Vážený, vaša žena má alebo Alzheimerovu chorobu, alebo AIDS.\r\nMuž sa pýta:\r\n- Ale pán doktor, ako zistím, ktorú tu chorobu má?\r\nDoktor sa zamyslí a povie:\r\n- Viete čo, zaveďte ju do lesa a ak sa vráti, radšej s ňou nespite. ', 323, 3.31, 32),
	(6750, 'Príde k lekárovi žena a vraví:\r\n"Necítim sa dobre pán doktor!"\r\nDoktor:\r\n"Odmeriam vám teplotu, sadnite si zatiaľ"\r\nŽena:\r\n"Pááán doktor ale ten teplomer ste nedali pod pazuchu!"\r\nDoktor:\r\n"Ja viem, veď to ani nie je teplomer!"', 240, 3.12, 32),
	(6751, 'Pacient: \r\n- Pán doktor, ja viem že manželstvo je najdokonalejší spôsob spolužitia dvoch ľudí, ale niečo predsa musí byt vymyslené aj pre človeka!', 159, 3.62, 32),
	(6752, '- Pán doktor, trháte zuby bez bolesti?\r\n- Nie vždy, občas má niekto pohryzie.', 82, 3.15, 32),
	(6753, 'Príde 150kg žena ku gynekológovi, sadne na kozu rozkročí nohy a gynekológ vraví:\r\n- Pani, prdnite si, aby som sa zorientoval.', 132, 3.43, 32),
	(6754, 'Gynekológ po 48 hodinovej šichte vyjde na ulicu a povzdychne si: \r\n- Konečne tváre!', 87, 3.49, 32),
	(6755, 'Napis v ordinácii:\r\n\'Dezerty a kvety nepijem.\'', 47, 3.25, 32),
	(6756, '- V ktorej izbe sa nachádza ten pán, čo ho prešiel vlak?\r\n- V izbách 134 a 135.', 84, 3.67, 32),
	(6757, 'Chlapík ide na plavbu oceánom a hovorí doktorovi, že sa obáva, že dostane morskú chorobu. \r\nDoktor mu hovorí: "Len zjedzte kilo dusených paradajok, kým odídete na loď." \r\nChlapík: "A to mi pomôže ?" \r\nDoktor: "Nie, len to vyzerá veľmi pekne vo vode."', 267, 3.12, 32),
	(6758, 'U psychiatra.\r\n- Trpel u vás niekto gigantomániou?\r\n- Jasnačka. Muž si občas myslí, že je hlava rodiny.', 110, 2.73, 32),
	(6759, 'Vojde pacient do ordinácie:\r\n- Pán doktor, ja sa pre každú somarinu hneď naštvem.\r\n- A prečo?\r\n- A čooo prečooo!', 121, 2.97, 32),
	(6760, 'U gynekológa:\r\n"Pán doktor, mám problém, mám studené stehná..."\r\n"Pani, ja v tom žiadny problém nevidim, naozaj vám to prekáža?"\r\n"Viete, mne ani tak nie, ako môjmu manželovi. Stále si sťažuje na zápal stredného ucha..."', 239, 3.26, 32),
	(6761, 'Pri záverečnej skúške z chirurgie sa profesor pýta študenta:\r\n- Prečo si chirurgovia pri operácii dávajú na tvár rúšku?\r\n- Aby ich nik nespoznal, ak sa operácia nepodarí.', 185, 3.08, 32),
	(6762, '- Pán doktor, koľko času mi ešte zostáva?\r\n- Trvanlivé mlieko radšej nekupujte.', 86, 3.03, 32),
	(6763, 'Po narkóze sa preberie pacient a pýta sa:\r\n- Pán doktor, ešte žijem?\r\n- Čo ja viem, ale tie krídla sú nejaké podozrivé.', 129, 2.92, 32),
	(6764, 'Manželka ide za lekárom a sťažuje sa: \r\n- Pán doktor, vždy, keď uvarím kávu, tak manžel vypije kávu, zje aj šálku a uško nechá. \r\nDoktor hovorí:\r\n- To je naozaj zvláštne, veď uško je to najlepšie.', 217, 3.48, 32),
	(6765, '- Pán doktor, ja mám vtáka - ohniváka.\r\n- No, to je snáď dobre, nie?\r\n- Vy mi nerozumiete. On mi ohníva.', 111, 3.12, 32),
	(6766, 'V nemocnici vezie sestrička pacienta na pohyblivej posteli a ten jej tichým hláskom hovorí: "Sestrička skúsme na ARO." \r\nOna na to: "Ticho!" \r\nPacient opäť: "Sestrička skúsme na ARO." \r\nOna: "Ticho, nevyrušujte!" \r\nPacient znova: "Ale sestrička, prosím, skúsme na ARO."\r\nSestrička: "Pán doktor povedal do márnice, tak do márnice!!!"', 350, 3.93, 32),
	(6767, '- Pán doktor, veľmi ma trápi predčasný výron semena.\r\n- Tak sa na to pozrieme. Dajte si dole nohavice a spodky. \r\nChlapík poslúchne, lekár sa zohne, okamžite sa prudko narovná a vytierajúc si oči zahundre:\r\n- Hm, to teda máte... a v sakramentsky pokročilom štádiu! ', 282, 3.02, 32),
	(6768, 'Príde pani ku gynekológovi.\r\n"Pán doktor, pomôžte mi, hrala som sa s vibrátorom a zasekol sa mi tam."\r\n"Tak sa vyzlečte ja sa na to pozriem."\r\nDoktor jej tam šmátra a po chvíli povie:\r\n"Mám jednu dobrú a jednu zlú správu."\r\n"Začnite tou zlou."\r\n"Nepodarilo sa mi ho vybrať, ale stihol som vymeniť baterky."', 323, 3.08, 32),
	(6769, '- Pán doktor, mne asi hnije.\r\n- Hm, postavte sa na túto stoličku. No... pekne. Tak a teraz zoskočte... No vidíte! Odpadol aj sám!', 135, 2.94, 32),
	(6770, '- Pán doktor, nevidím do diaľky.\r\n- Tak sa pozrite hore na oblohu. Čo tam vidíte?\r\n- Slnko.\r\n- No a to by ste chceli vidieť ešte ďalej?', 143, 3.05, 32),
	(6771, 'Gynekológ pozerá pacientke medzi nohy, keď sa zrazu otrasie a vraví: \r\n- Fúha, milá pani, ani si neviete predstaviť, akú chuť som dostal na plesnivý syr.', 163, 2.79, 32),
	(6772, 'Ožratý chlap búcha na dvere ambulancie. \r\n- Otvorte, otvorte, pichá má v krížoch. \r\nOtvorí rozčúlený doktor a zrúkne naňho:\r\n- Čo tu vrieskate, tu ste v nemocnici a nie dakde v maštali. Čo tu chcete!? Zmiznite! A čo vám to vlastne je?\r\n- Ále, pichá má v krížoch.\r\n- A kvôli tomu má tu teraz otravujete? Ja mám o päť minút fajront. \r\nZrazu sa doktor preľakne a skríkne:\r\n- Preboha, veď vy máte v chrbte zapichnutý nôž.\r\n- No veď som vám hovoril, že má tam dačo pichá.\r\nDoktor sa zamyslí a hovorí:\r\n- Viete čo, na krčnom robia o hodinu dlhšie.\r\nVytiahol nôž a pichol mu ho do krku.', 628, 3.2, 32),
	(6773, '- Pán doktor, som strašne chorý, všade má bolí, všade má pichá. Čo mi je?\r\n- To neviem, to ukáže pitva.  ', 117, 3.21, 32),
	(6774, 'Doktor príde k pacientovi a hovorí mu:\r\n"Mám pre Vás dve správy,jednu dobrú,druhú zlú. Ktorú chcete počuť?"\r\n"No najprv tú zlú."\r\n"Viete,ste smrteľne chorý a Vaše dni sú už spočítané."\r\n"A teraz tá dobrá správa?!"\r\nDoktor sa poobzerá dookola a hovorí:\r\n"Vidíte tú mladú,peknú sestričku s tými dlhými nohami?"\r\n"Vidím a čo má byť?"\r\n"Tak s tou som sa celú noc miloval."', 406, 3.2, 32),
	(6775, 'Muž príde k lekárovi a hovorí: \r\n- Pán doktor, som ženatý 10 rokov a z toho 9 rokov ma žena podvádza. Prečo mi ešte nenarástli parohy?\r\n- Ale veď to sa len tak hovorí, v skutočnosti vám parohy nenarastú.\r\n- Chvalabohu, už som si myslel, že mám nedostatok vápnika.', 284, 3.02, 32),
	(6776, 'Poľnohospodár spadol pri milovaní z postele a zlomil si ruku. Mal známeho, ktorý bol doktor a ten to našil ako pracovný úraz. Do lekárskeho posudku napísal:\r\n"Spadol pri sejbe semena zo starej mašiny."', 212, 3.43, 32),
	(6777, 'Príde chlap k lekárovi a hovorí.\r\n- Pán doktor, mám ho takého malého, že ho vôbec nevidieť.\r\n- Tak ukážte.', 118, 2.87, 32),
	(6778, 'Príde žena ku gynekológovi, že si tam zabudla vibrátor a nejde vybrať. Gynekológ:\r\n- Žiaden problém, posaďte sa. \r\nChvíľu jej tam šmátra a potom vraví:\r\n- Mám pre vás dve správy. Jedna zlá a druhá dobrá. Zlá je tá, že sa mi ho nepodarilo vybrať a dobrá, že sa mi podarilo vymeniť v ňom baterky.', 323, 3.22, 32),
	(6779, 'Doktor hovorí sestričke:\r\n"Pobozkajte ma!"\r\n"Nemôžem pán doktor."\r\n"Ale sestrička veď ma pobozkajte!"\r\n"Nemôžem pán doktor."\r\n"No tak, veď nerobte drahoty a pobozkajte ma", nalieha doktor.\r\n"Nemôžem pan doktor, veď už aj tak som cela nesvoja, keď tu ležím takáto nahá pod vami."', 298, 3.59, 32),
	(6780, 'Doktor poučuje pacienta:\r\n- Tak a od zajtra žiadny alkohol, žiadne ženy a žiadne nákupy.\r\n- A to už prečo, pán doktor?\r\n- Aby ste mali peniaze na účet, ktorý vám vystavím!', 185, 2.96, 32),
	(6781, 'Mladá pohľadná dáma sedí u gynekológa. Keď sa už dostala na radu, vošla do dverí a keď ju gynekológ zbadal, prudko zatvoril dvere, mrskol ju na kozu, strhol z nej šaty a okamžite pomiloval. Hneď potom hovorí:\r\n"Mladá pani, tak toto bol môj problém, a aký je ten váš?"', 289, 3.24, 32),
	(6782, 'Príde chlapík k doktorovi a hovorí:\r\n"Pán doktor, ja som strašne nervózny."\r\nDoktor:\r\n"No v poriadku, a prečo ste stále nervózny?"\r\nChlapík:\r\n"Čo prečo?"', 165, 3.15, 32),
	(6783, 'Psychiatrická hotline...\r\nDovolali ste sa na psychiatrickú hotline. Aby sme vám mohli lepšie pomôcť, vyberte si, prosím, niektorú z nasledujúcich možnosti: \r\nAk ste obsesívne-kompulzívny, stlačte, prosím, číslo jeden. Opakovane! \r\nAk trpíte rozpoltenou osobnosťou, stlačte tlačidla dve, tri a štyri. \r\nAk máte paranoidnú psychózu, neskladajte prosím. Potrebujeme zamerať váš telefón. Dobre viete, kto sme a čo chceme. \r\nAk trpíte schizofréniou, vyčkajte prosím. Hlások vo vašej hlave vám pošepká ďalšie pokyny. \r\nAk ste v depresii, môžete zvoliť ľubovolne číslo. Aj tak vám nik neodpovie!', 636, 3.6, 32),
	(6784, 'U lekára.\r\n- Pani, prosím vás, vyzlečte sa!\r\n- A kde si môžem dať šaty?\r\n- Vedľa mojich.', 97, 2.87, 32),
	(6785, 'Slova, ktoré by operovaný pacient nerád počul od chirurga:\r\n1. Ajaj...\r\n2. Nevidel niekto moje hodinky?\r\n3. Ani sa nepamätám, kedy som bol naposledy taky opitý ako včera.\r\n4. Do frasa. Práve 45. strana manuálu chýba!\r\n5. Prines naspäť! Zlý pes!\r\n6. Nože počkajme! Ak toto je pečeň, tak toto je čo?\r\n7. Škoda, že som si doma zabudol okuliare.\r\n8. Pacient už má deti, však?\r\n9. Neviem čo je toto. Rýchle to dajte do chladničky!\r\n10. Ponáhľajme sa, chcem vidieť Baywatch!', 498, 3.46, 32),
	(6786, 'U psychiatra:\r\n- Pán doktor, ešte som nikdy nič nedokončil, ale...', 70, 3.07, 32),
	(6787, 'Po autonehode:\r\nPri dopravnej nehode priviezli ženu do nemocnice. Keď sa prebrala z bezvedomia, lekár sa jej pýta. Koľko máte rokov pani?"\r\n"Dvadsatpäť."\r\n"Sestrička", hovorí doktor, "píšte: Pacientka stratila pamäť."', 231, 3.08, 32),
	(6788, 'Príde chlapík k lekárovi, že má modré jedno vajco. Lekár ho prezrie a vraví:\r\n"Nevyzerá to dobre, musím vám ho odrezať a poslať na výskum."\r\nO týždeň príde chlapík znova, že má modré aj druhé vajco.Zas mu ho odreže a pošle na výskum. O Ďalší týždeň príde, že má modrého vtáka. Tak mu ho lekár zase odreže a pošle na výskum. Po mesiaci dostane chlap pozvanie k lekárovi. Ten konštatuje:\r\n"Mám pre vás dobrú správu, nie je to nič vážne, to vám len farbili montérky."', 516, 3.48, 32),
	(6789, 'Vegetarián leží po úraze v nemocnici. Sestrička sa ho pýta:\r\n- Priniesli vám sem kvety od vašich priateľov?\r\n- Áno! Chutili...', 136, 3.5, 32),
	(6790, 'Pani je u gynekológa na prehliadke.\r\n- A jeje, to sa mi nepáči, pani Nováková.\r\n- Čo  pán doktor, je to zlé?\r\n- Ešte horšie, než si myslíte. Vypadá to na operáciu.\r\n- No to ja nemôžem, čo by si bezo mňa moja rodina počala? Nešlo by to zariadiť nejako inakšie?\r\n- Išlo, ale musela by ste aspoň mesiac vynechať všetok sex.\r\nPani Nováková sľúbila, že určite žiadny nebude. Keď odišla, pýta se sestrička doktora:\r\n- Čo vlastne bolo tej Novákovej? Mne pripadala byť celkom zdravá.\r\n- Aj bola, ale predbiehať v samoobsluhe, to sa nemá!', 572, 3.09, 32),
	(6791, 'Pacient sa pýta lekára.\r\n- Pán doktor, budem žiť?\r\n- Nie, prečo?', 70, 3.39, 32),
	(6792, 'Za dverami ordinácie:\r\n- Pán doktor, toto nie je pazucha!\r\n- Slečna, veď toto nie je teplomer.', 98, 3.05, 32),
	(6793, 'Ako zaženiete rakovinu? \r\nInfraktom.', 37, 2.69, 32),
	(6794, 'Príde babka k lekárovi a sťažuje sa:\r\n- Viete pán doktor, ja tak veľmi kašlem!\r\nLekár otvorí okno, ukáže na protiľahlý cintorín a hovorí:\r\n- Viete čo by dali za to, keby mohli kašlať?', 201, 3.06, 32),
	(6795, 'Príde  98 ročný dedko k lekárovi na vyšetrenie. Lekár mu meria tlak a pod. Po vyšetrení sa dedko pýta lekára:\r\n"Pán doktor, kde by som mohol dostať AIDS?"\r\nLekár celý zhrozený sa pýta dedka:\r\n"Preboha a načo by vám to bolo?"\r\nDedko nelenil a pohotovo odpovedal:\r\n"No ja som počul, že ľudia s Aidsom žijú ešte 10-15 rokov Pán doktor."', 358, 3.14, 32),
	(6796, '- Pán doktor, čo je s mojim šteniatkom? Lebo keď mu dám povel, vždy odpadne.\r\nDoktor na to:\r\n- Tak to vyskúšajte.\r\nChlapík sa nadýchne a z plného hrdla zreve:\r\n- ĽAHNI!!!', 182, 3.25, 32),
	(6797, '- Ľúbi ma, neľúbi ma, ľúbi ma, neľúbi ma...\r\n- Doktor, čo mi to robíte so zubami?', 91, 3.52, 32),
	(6798, 'Vbehne chlapík k lekárovi, oči vypúlené a volá:\r\n- Doktor, pomôžte mi, nechce mi stáť!\r\nLekár si vyhrnie rukávy a zreve:\r\n- A koho by si tu chcel pretiahnuť?! ', 172, 3.11, 32),
	(6799, 'Matka príde s dcérou k lekárovi a vraví :\r\n- Pán doktor, prosím Vás, nepozreli by ste sa na moju dcéru, prečo má také vypleštené oči?\r\nDoktor si ju prezrie a povie:\r\n- Povoľte jej gumičku vo vlasoch.', 215, 3.12, 32),
	(6800, 'Príde chlap k doktorovi: \r\n- Je mi to trápne, ale môj syn sa vyspal s nejakým dievčaťom a tá ho nakazila nepríjemnou chorobou...\r\n- Aha. No tak nech príde, pokúsime sa to nejako vyliečiť.\r\n- Lenže on sa nakazil s našou slúžkou a tá tým pádom nakazila aj mňa.\r\n- No teda, už chápem, tak sa teda vyzlečte.\r\n- Ibaže zákonite som pre zmenu ja zasa nakazil manželku.\r\nTo už lekára dorazí a zareve:\r\n- Takže kvôli tvojmu mladému parchantovi sa v tom teraz vezieme všetci!', 498, 3.49, 32),
	(6801, '- Pán doktor, dajte mi nejaký liek proti chamtivosti! Ale veľa, veľa, veľa! ', 81, 3.21, 32),
	(6802, 'Psychiater pacientovi: \r\n- Tak vy tvrdíte, že žijete na Slovensku a ste celkom spokojný? Pokračujte, takáto choroba nebola u nás ešte zaznamenaná.', 155, 3.27, 32),
	(6803, 'Lekár pacientovi:\r\n- No tak sme dostali definitívne výsledky vašich testov. Do týždňa ste z nemocnice vonku.\r\n- Výborne, ďakujem pán doktor!\r\n- Ééé... Vy ste ma nesprávne pochopili...', 197, 2.91, 32),
	(6804, '- Pán doktor je tá moja choroba vzácna?\r\n- Ani nie, sú toho plné cintoríny.', 81, 3.11, 32),
	(6805, 'Nový spôsob operácie žalúdka špongiovou metódou.Všetko prebieha v poriadku, až pri poslednom stehu lekár zistí, že zašil aj špongiu. Nechá to však tak a rozhodne sa počkať na prvú kontrolu.Po mesiaci.\r\n"Tak ako sa máte, všetko v poriadku?"\r\n"Všetko v poriadku až na jednu malú chybičku."\r\n"Akú?"\r\n"Viete, vypijem pol deci, nič. Vypijem pol litra pálenky, nič.Vypijem fľašu pálenky, nič. Ale keď zatiahnem opasok na nohaviciach, v momente som ožratý."', 486, 3.31, 32),
	(6806, '- Pán doktor, - vraví žena - mám strašne studené stehná. \r\n- A vám to vadí ? \r\n- Mne nie, ale manžel má stále zápal stredného ucha.', 145, 3.26, 32),
	(6807, 'TELEFONÁT NA 155:"Pomoc zomieram ."\r\nDOKTOR :"Bohužial nemáme."', 66, 2.92, 32),
	(6808, 'Príde pán k doktorovi. Doktor hovorí:\r\n- Vyzlečte sa.\r\nPán sa nevyzlieka. Doktor opakuje:\r\n- Vyzlečte sa.\r\nChlap sa vyzlečie, doktor ho prezrie a hovorí:\r\n- Vám nič nie je.\r\n- Veď hej, pán doktor, priviezol som vám to uhlie.', 237, 3.2, 32),
	(6809, 'Študenti biológie absolvujú hodinu na patológii. Nakoľko patológ je tvrďas, začína hodinu asi takto:\r\n- Študenti, za prvé, patológ sa nesmie štítiť  ničoho.\r\nPričom vezme do ruky skalpel, spraví priečny rez skrz "pacientovo" prirodzenie, strčí dnu prst a potom prst oblizne. Študenti teda so skrytým odporom jeden po druhom zopakujú čo práve videli, keď patológ pokračuje:\r\n- A za druhé, patológ musí byt veľmi pozorný, teda ste si určite všimli, že som tam strčil ukazovák a oblizol prostredník.', 536, 3.32, 32),
	(6811, '- Kde si bol?\r\n- U doktora?\r\n- A čo máš za chorobu?\r\n- Neviem, ale pamätám si, že to má niečo spoločné so sklom a s ružami?\r\n- Skleróza?\r\n- No to je ono. Ako si to povedal?', 184, 2.89, 32),
	(6812, '- Pán doktor, mám sklerózu.\r\n- A od kedy sa vám to prejavuje?\r\n- A čo od kedy?', 83, 3.18, 32),
	(6813, 'Do ordinácie vstúpi dáma s koňskou hlavou.\r\n- Pán doktor, toto mi cez noc narástlo.\r\nDoktor si koňskú hlavu chvílku obzerá, potom si sadne a píše.\r\n- A pomôže mi to? Pýta sa dáma.\r\n- Čo Vám má pomôcť?\r\n- Tie lieky čo mi predpisujete.\r\n- Ale milá pani, to nie je predpis. To je povolenie, že na ulici môžete kadiť ako kobyla.', 351, 3.07, 32),
	(6814, '- Pán doktor, koľko mi teda ešte tak ostáva času?\r\n- No s televíznymi seriálmi by som už nepočítal.', 109, 3.31, 32),
	(6815, 'V lekarni:\r\n- Nie pane, na arzen musíte mať recept. Fotka vašej svokry naozaj nestačí.', 91, 3.31, 32),
	(6816, '- Doktor, doktor,  mám 59 sekúnd života.\r\n- Oh, počkajte minútku.', 70, 3.13, 32),
	(6817, '- Som tu dobre, na ušnom?\r\n- Čožéé ?\r\n- Hmm. Som tu dobre. ', 64, 3.09, 32),
	(6818, 'Študentka medicíny predvádza na makete pôrod kliešťami. Profesor ju chvíľu pozoruje a hovorí: \r\n- Výborne! Teraz ešte tými kliešťami buchnite otca po hlave a vyvraždili ste komplet celú rodinu.', 209, 3.38, 32),
	(6819, '- Pán doktor, keď žartujem, každý si myslí, že to myslím vážne a keď niečo myslím vážne, všetci si myslia, že žartujem.\r\n- Žartujete!?', 153, 2.92, 32),
	(6820, '- Pán doktor, každý mi hovorí, že som srandista.\r\n- Vy žartujete!', 71, 3.14, 32),
	(6821, 'Zdravotná sestra sa nakloní nad posteľ a vraví pacientovi:\r\n- Až príde lekár, povedzte mu niečo povzbudzujúce, lebo váš zdravotný stav mu robí veľké starosti.', 173, 3.1, 32),
	(6822, 'Príde pacient k lekárovi a sťažuje sa, že má hnačku. Lekár mu dá lieky na upokojenie. Pacient reaguje:\r\n- Ale ja nie som nervózny, ja mám len hnačku! \r\nZa dva dni príde na kontrolu a lekár sa pýta:\r\n- Máte ešte hnačku?\r\n- Mám, no a čo?', 255, 3.32, 32),
	(6823, 'Príde pani do nemocnice spýtať sa na svojho manžela. Doktor jej hovorí:\r\n- Pani Nováková, mám pre vás smutnú správu. Váš manžel mal nádor na mozgu. Snažili sme sa ho zachrániť, ale umrel hneď po amputácii hlavy.', 231, 3.1, 32),
	(6824, 'Príde chlapík k doktorovi a hovorí:\r\n- Pán doktor, mám problémy s močením. Už tri dni sa nemôžem vymočiť.\r\n- Dajte si dolu nohavice.\r\nDoktor sa pozrie chlapovi na prirodzenie a zbadá na ňom veľký uzol: \r\n- Človeče, veď vy tam máte uzol.\r\nChapík sa pozrie a skríkne: \r\n- Ježišmária, zabudol som kúpiť chleba!', 335, 3.34, 32),
	(6825, 'V lekárskej izbe si pri káve 5 chirurgov vymieňa skúsenosti. Prvý hovorí: \r\n- Najradšej mám na operačnom stole účtovníkov. Všetko je v nich presne očíslované.\r\n- Nie je lepšie operovať elektrikára? Všetko je v nich pekne farebne odlíšené -  hovorí druhý.\r\n- Ja si myslím, že ešte lepšie sa operujú knihovníci. Všetko je v nich usporiadané pekne v abecednom poriadku - mieni tretí.\r\n- Osobne najradšej operujem stavebných robotníkov - hovorí štvrtý. Ak z nich ostane niečo vonku po zašití, majú pre to najviac porozumenia.\r\n- Ja zas najradšej oprerujem politikov - mieni piaty. Nemajú srdce, mozog, chrbtovú kosť a hlavu s konečníkom možno vzájomne zameniť.', 709, 2.94, 32),
	(6826, 'Pitva potvrdila, že pacient zomrel počas pitvy...', 51, 3.16, 32),
	(6827, 'Vraví lekár pánu Babicovi:\r\n- Predpísal som vám uhlie v tabletkách.\r\n- Ste veľmi milý, ale ja kúrim drevom!', 116, 2.93, 32),
	(6828, 'Mladá mamička bola so svojím synom na návšteve u známeho doktora. Nijako sa nasnažila brániť synovi, ktorý rozhadzoval doktorovi ordináciu. Keď sa však ozval zvláštny rachot, povedala:\r\n- Dúfam, že vám nevadí, že sa tam Petríček hrá!\r\n- Nevadí. On stíchne, keď sa dostane k jedom.', 306, 3.39, 32),
	(6829, 'Primár mladému chirurgovi:\r\n- Počas tohto mesiaca ste zničili už tretí operačný stôl. Nesmiete pri rezaní tak tlačiť, pán kolega!', 142, 3.28, 32),
	(6830, 'Príde matka s dcérou k lekárovi a vraví:\r\n- Pán doktor, prosím vás, nepozreli by ste sa na moju dcéru, prečo má také vytreštené oči?\r\nDoktor si ju prezrie a povie:\r\n- Povoľte jej gumičku vo vlasoch.', 214, 3.22, 32),
	(6831, '- Pán doktor, nemôžem piť.\r\n- Dajte sem, ja vypijem.', 56, 3.17, 32),
	(6832, '- Pán doktor,  môj penis v stoporenom stave meria 3 centimetre. Mohli by ste sa k tomu nejako vyjadriť?\r\n- Bohužial nie. Mám opar, nemôžem sa smiať.', 156, 3.02, 32),
	(6833, 'Pacient príde k lekárovi:\r\n- No, čo? Pomohli tie guľôčky do kúpeľa, ktoré som vám predpísal?\r\n- Nuž ja vlastne ani neviem. Keď ony sa tak ťažko prehĺtali.', 170, 2.82, 32),
	(6834, 'U zubára:\r\n- Koľko ma bude stáť to vytrhnutie zubu?\r\n- 500,- Sk.\r\n- Čože? Toľko za 5 minút roboty?\r\n- Nuž, keď chcete, tak ja vám ho môžem trhať aj pol dňa.', 171, 3.03, 32),
	(6835, '- Pán doktor, každému, komu poviem "abraka-dabra", zmizne! Pán doktor, kde ste?', 83, 3.05, 32),
	(6836, 'U zubára:\r\n- Pán doktor,č o stojí vytrhnutie zuba?\r\n- 2500 korún.\r\n- Dvaapol tisícky za dve minúty? To je veľa!\r\n- V poriadku, ak chcete, budem vám ho trhať dve hodiny.', 178, 2.92, 32),
	(6837, 'Žena u lekára:\r\n- Pán doktor mám problém, vždy keď si zapálim dostanem chuť na sex. \r\n- Hmm, to je na dlhšiu debatu. Najprv si hádam zapálim.', 153, 3.36, 32),
	(6838, 'U lekára:\r\n- Tu máte tieto tabletky. Večer pred spaním si dajte dve a ak sa ráno zobudíte, dajte si ďalšie dve.', 119, 3, 32),
	(6839, '- Pán doktor, je impotencia vážna choroba?\r\n- Ani nie, dá sa z nej vylízať!', 81, 2.94, 32),
	(6840, 'Pacient príde k lekárovi nešťastný, pretože sa pomočuje. Lekár mu odporučí psychoterapiu. Po týždni sa lekár pýta:\r\n- Tak čo, pomohla psychoterapia? Už sa nepočúravate? \r\nPacient odpovedá: \r\n- Počúravam sa rovnako, ale už ma to nedeptá a som na to hrdý!', 277, 2.98, 32),
	(6841, 'Araňa príde k doktorovi a sťažuje sa mu:\r\n"Pán doktor, smrdí mi vagína."\r\n"Araňa, snažili ste sa ju aj umyť?"\r\n"Čo Vám šibe, kto by sa s takým smradom bavil."', 172, 2.98, 32),
	(6842, 'Pán doktor, ďakujem, že ste ma vyliečili z megalománie.\r\nKoľko miliónov som vám dlžný?', 96, 3.17, 32),
	(6843, 'Príde pacient do laboratória s 3-litrovou fľašou moču.\r\n"Už vám chýba iba kýbel hovien."\r\nHovorí mu laborant ironicky.\r\n"Počítal som s tým..."\r\nvraví pacient, vyťahujúc ho spoza chrbta.', 201, 3.15, 32),
	(6844, 'U psychológa:\r\nDoktor: \r\n- Vy ste nejaký flegmatik.\r\nPacient: \r\n- Mne je to jedno.', 84, 3.06, 32),
	(6845, 'Chlapík u lekára:\r\n- Pán doktor, ja som stolár a nemôžem pracovať.\r\n- A čo vám chýba?\r\n- Dosky.', 105, 2.91, 32),
	(6846, 'Lekár telefonuje pacientovi:\r\n"Mám pre Vás 2 správy, jednu dobrú a druhú zlú. Ktorú chcete počuť skôr?"\r\n"Tú dobrú."\r\n"Máte pred sebou ešte 24 hodín života."\r\n"A teraz tú zlú?!"\r\n"Včera som sa Vám nemohol dovolať!"', 236, 3.09, 32),
	(6847, 'Dřevorubec přijde o ruku. V nemocnici mu přidělají umělou, ovládanou hlasem. Prý bude ješte silnějsí než původní. Dřevorubec souhlasí. Jde na záchod a říká:\r\n"Rozepnout!"\r\n"ZZZZZZ"\r\n"Podržet, protřepat! Auuuu, nechceš mi ho ještě urvat?"\r\n"TRH."\r\n"Do prdele!"\r\n"ŠUP."\r\n"Do hajzlu!"\r\n"ŠVIH."', 317, 3.52, 32),
	(6848, 'Chlapík dostane pozvánku na lekársku kontrolu. Príde do nemocnice, absolvuje všetky rutinné vyšetrenia a o 2 dni príde na výsledky.\r\nLekár si ho posadí pred seba a hovorí:\r\n"Chlapče, máte problém, pri prehliadke sme zistili, že máte atypické\r\nsemenníky."\r\nChlap na neho nechápavo hľadí.\r\n"No, jednoducho máte jedno vajco drevené a jedno kovové."\r\nChlapík stále nič.\r\n"Človeče, ako s tým žijete? Máte vôbec deti?!"\r\n"Áno."\r\nOdpovedá chlap,\r\n"Pinochio má 3 a Terminátor bude mať sedem."', 523, 3.21, 32),
	(6849, 'Chlap príde k lekárovi a hovorí mu:\r\n"Pán doktor, strašne mi smrdí z huby, čo mám robiť?"\r\n"Doktor mu povie, aby na neho dýchol."\r\nPo dlhotrvajúcom sa dusení konečne doktor príde k životu a hovorí chlapíkovi"\r\n"No, pre začiatok by som Vám doporučil 3-krát denne kloktať hovná."', 300, 3.39, 32),
	(6850, 'Anjel si sadne na okno ambulancie a vraví:\r\n- Pán doktor, pán doktor nezdá sa vám že veľa fajčíte? \r\n- Ale veď aj moji kolegovia veľa fajčia.\r\n- Pán doktor ale vy aj dosť pijete.\r\n- Ale veď aj moji kolegovia si dosť vypijú.\r\n- Pán doktor ale vy aj smilníte s pacientmi.\r\n- Ale veď aj moji kolegovia to robia.\r\n- Pán doktor, pán doktor ale vy ste veterinár!', 379, 3.11, 32),
	(6851, '- Pán doktor, pomôžte mi, každý ma stále iba ľutuje!\r\n- Och, vy chudáčik!', 82, 2.83, 32),
	(6852, '- Pán doktor, čo mi odporučíte na moje vrásky na krku?\r\n- Rolák, milá pani.', 82, 2.91, 32),
	(6853, 'Príde podnikateľ k doktorovi a doktor hovorí:\r\n- Vyzlečte sa.\r\n- Aj mobil?', 78, 3, 32),
	(6854, 'Príde dedko k lekárovi.\r\n- Pán doktor, mám stále problémy so stolicou.\r\n- A ako často a kedy ju mávate?\r\n- Každé ráno.\r\n- No tak potom čo chcete? Ja by som bol šťastný, keby som to mal ako vy. \r\n- Lenže ja ju mávam o štvrtej a vstávam o pol šiestej.', 269, 3.06, 32),
	(6855, '- Pán doktor, prosím si vitamín pre svojho syna.\r\n- Aký si želáte? A,B alebo C?\r\n- To je úplne jedno. Chlapec má len päť, ešte sa nenaučil čítať. ', 161, 2.82, 32),
	(6856, '- Pán doktor, čo mám robiť? Na určitých miestach stále priberám. \r\n- Tak na tie miesta nechoďte!', 105, 2.96, 32),
	(6857, 'Rozprávajú sa dvaja zverolekári, ktorí práve dooperovali slona. Prvý hovorí:\r\n- Dnes nám to išlo skvele. Dokonca sme si tam nezabudli ani žiadne chirurgické nástroje.\r\nDruhý hovorí:\r\n- Áno nezabudli, ale kde je sestrička?', 237, 2.86, 32),
	(6858, 'Doktori sa dohadujú o pacientovi:\r\n- Budeme ho liečiť alebo ho necháme žiť?', 81, 3.27, 32),
	(6859, 'Príde pacient k doktorovi.\r\n- Pán doktor ja som strašne nervózny.\r\n- A prečo?\r\n- Čo prečo, čo prečo!!!', 111, 3, 32),
	(6860, 'Aký je rozdiel medzi doktorom a pacientom na psychiatrii?\r\nDoktor má kľúče.', 80, 3.17, 32),
	(6861, 'Smrteľne chorý pacient sa pýta sestricky:\r\n"Sestrička, mám ešte nejakú šancu?"\r\n"Vy? Vy vôbec nie ste môj typ."', 121, 2.95, 32),
	(6862, 'Príde prostitútka ku gynekológovi a hovorí:\r\n"Pán doktor, som tehotná"\r\n"A kto bube tým šťastným oteckom?"\r\n"Pán doktor, kebyže vám prejdem cirkulárkou po zadku, spoznali by ste, ktorý zub bol prvý?"', 215, 2.94, 32),
	(6863, 'Aké sú ordinačné hodiny gynekológa?\r\nCez týždeň do druhej cez víkend do svojej.', 88, 3.22, 32),
	(6864, 'Lekár hovorí pánovi Kováčovi:\r\n- Vaše nervy sú v hroznom stave.\r\n- To je od rybárčenia, -povie pán Kováč.\r\n- Ale veď to je tichá,neškodná záľuba.\r\n- To áno,ale iba vtedy, keď máte rybársky lístok.', 219, 3.09, 32),
	(6865, 'Cedulka na ordinácii:\r\nKvetiny a bonboniery nepijem!', 53, 3.1, 32),
	(6866, 'Lekár prezerá deti. Žena je škaredá a hluchonemá, muž škuľavý, rapavý, bezruký a kríva. Deti, chlapček a dievčatko, sú krásne a zdravé. Pri pohľade na ne zvolá: \r\n- Už viem, prečo sa hovorí, že deti sú zázrak prírody!', 244, 3.01, 32),
	(6867, '- Pán doktor, asi trpím schizofréniou.\r\n- Ak sa to nezlepší, tak o týždeň príďte na kontrolu. Ale po jednom.', 118, 2.78, 32),
	(6868, 'Pýta sa lekár novej sestričky:\r\n"Zobrali ste krv tomu na trinástke?"\r\n"Áno pán doktor, ale iba šesť litrov!"', 116, 3.07, 32),
	(6869, 'Viete kedy je s vami po príchode k lekárovi naozaj veľmi zle?\r\nKeď vytiahne foťák...', 90, 3.28, 32),
	(6870, '"Pán doktor asi som neviditeľný!"\r\n"Kto to povedal?"', 55, 3.16, 32),
	(6871, 'Slabučký, vysilený deduško leží v nemocnici a volá na sestričku.\r\n- Sestra, sestra, je tu pavúk!\r\n- Ale deduško, ja mám teraz veľa práce, malý pavúčik vám predsa neublíži. A navyše pavúčiky prinášajú šťastie.\r\nO malú chvíľu sa z izby slabučkým, vysileným hláskom ozve:\r\n- Kam ma to ťaháš, ty potvora!', 337, 2.82, 32),
	(6872, 'Přijde takhle teplouš,alkoholik a kuřák k doktorovi.Doktor je všechny tři prohlídne a říká:\r\n"Ty kuřáku ještě jeden nedopalek tak seš tuhej,ty alkoholiku ještě jednoho panáka tak si taky tuhej a ty homouši ještě jeden pohlavní styk s mužem tak si mrtvej."\r\nTak jdou ti tři po městě a alkoholik vidí u popelnice nedopitou flašku vodky, a jak to nemůže už vydržet tak se napije a v tu ránu je mrtvej. Tak už jdou jenom gay s velkým G a silný kuřák  s velkým K sami dva v temný uličce a ten kuřák vidí na zemi doutnající nedopalek a ten teplouš mu říká:\r\n"Radši se neohýbej,nebo chcípnem oba!"', 643, 3.01, 32),
	(6873, 'Do ambulancie príde pacient a hovorí doktorovi: \r\n- Pán doktor, potreboval by som lieky proti chamtivosti. Ale veľa, veľa.', 127, 3.3, 32),
	(6874, 'U psychiatra: \r\n- Slečna, a s tými antidepresívami opatrne. Neberte to na ľahkú váhu. \r\n- Tak tie kilá som pol roka zhadzovala zbytočne?', 144, 2.75, 32),
	(6875, 'Hovorí doktor pacientovi:\r\n- Mám pre vás jednu dobrú a jednu zlú správu. Ktorú chcete počuť najskôr.\r\n- Najskôr tu dobrú.\r\n- Tá choroba sa bude volať po vás.', 172, 2.93, 32),
	(6876, 'Pacient vola doktorovi: \r\n- Pán doktor, ako mi dopadli testy? \r\n- No, mám pre vás jednu dobrú a jednu zlú správu. Ktorú chcete najprv počuť? \r\n- Najprv tu dobrú. \r\n- Zostávajú vám tri dni života. \r\n- A potom aká je tá zlá? \r\n- No, už sa vám dva dni neviem dovolať.', 284, 3.01, 32),
	(6877, '- Pán doktor, ja keď sa milujem so svojou ženou, raz mi je zima, raz mi je teplo.\r\n- Hmm, a ako často sa milujete?\r\n- No, raz v zime a raz v lete.', 150, 2.82, 32),
	(6878, 'Pacient hovorí sestričke:\r\n- Sestrička, vy máte krásne nohy. Mohli by sme sa stretnúť medzi jednou a druhou?', 115, 3.14, 32),
	(6879, 'Pýta sa sestrička lekára pred operáciou:\r\n"Dáme si rukavice?"\r\n"Načo? Veď je teplo."', 91, 2.92, 32),
	(6880, 'Brutálny pôrod v nemocnici. Rodička kričí a gynekológ to už z nej vyťahuje. Keď to už hodnú chvíľku drží v ruke a pozerá na to znechutene povie:\r\n"Ak to do 5 sekúnd nezačne plakať, je to Nádor."', 214, 2.95, 32),
	(6881, 'Dvom černochom sa narodí dieťa s ryšavými vlasmi. Manželka povedala doktorovi, aby to vysvetlil manželovi.\r\n- Ako často ste mali s manželkou sex? - spytuje sa doktor.\r\n- Tak raz za mesiac.\r\n- No vidíte, čo ste urobili s tým hrdzavý penisom.', 253, 3.09, 32),
	(6882, 'Matka s dcérou došli k lekárovi. Lekár sa otočí k dcére a hovorí: \r\n- Vyzlečte sa.\r\nMatka na to: \r\n- Pán doktor, ale chorá som ja!\r\n- Tak vyplazte jazyk!', 164, 3.17, 32),
	(6883, 'Lekár sa prechádza po cintoríne a spomína si:\r\n- Túto som operoval. tohto som operoval, aj tohto som operoval ...', 118, 3.05, 32),
	(6884, 'Príde farár do nemocnice odovzdať moč. Sestra jeho nádobu s močom rozbije a bolo by trápne pýtať od farára ešte raz a kvôli tomu naplní nádobu svojou telesnou tekutinou. Na druhý deň hovorí lekár:\r\n"Je mi to ľuto, ale musím vám oznámiť, zlú správu, ste tehotný!"\r\n"Boha ja toho kostolníka zabijem!"', 325, 3.25, 32),
	(6885, 'Lekár hovorí pacientovi:\r\n"Mám pre vás dve správy - dobrú a zlú"\r\nPacient odpovie:\r\n"Tak najskôr tú zlú."\r\n"Museli sme Vám amputovať obe nohy."\r\n"Dobre, teraz tú dobrú?"\r\n"Máte ho až po zem!"', 207, 3.18, 32),
	(6886, '- Dedko, pijete alkohol?\r\nPýta sa lekár dedka.\r\n- Keď sa už, pán doktor, tak pekne pýtate, pohárik môžete uliať.', 122, 2.88, 32),
	(6887, 'Príde lekár k pacientovi na oddelenie zlomenín.\r\n"Ešte vás bolí noha?"\r\n"Nie!"\r\n"Tak vám dáme dole sadru."', 114, 2.61, 32),
	(6888, '- Pán doktor, všetci ľudia mi hovoria, že som klamár.\r\n- Neverím vám.', 76, 2.82, 32),
	(6889, '"Pán doktor pomôžte mi, každý ma ignoruje!"\r\n"Ďalší prosím!"', 69, 3.06, 32),
	(6890, 'Miliardár sa sťažuje lekárovi:\r\n- V poslednej dobe sa mi, pán doktor, zhoršuje pamäť.\r\n- Buďte rád, budete mať aspoň čistejšie svedomie.', 150, 3.35, 32),
	(6891, 'Doktor pacientovi:\r\n- Vidíte tú malú bodku na snímke  vašich pľúc?\r\n- Áno vidím. Takže to nebude až také zlé, však?\r\n- Tak to je jediné zdravé miesto.', 166, 3, 32),
	(6892, 'Príde pacient k doktorovi a sťažuje sa na bolesti hlavy. Doktor prevedie viacero vyšetrení a po pol hodine si zavolá pacienta do ordinácie.\r\n"Tak, zistil som že vám ostáva ešte 10..."\r\n"10 čoho? rokov, mesiacov, ..."\r\n"9..8..7..6..5.."', 247, 3.1, 32),
	(6893, 'Príde pacient k doktorovi.\r\n"Dobrý deň pán doktor ako sa dnes máme?"\r\n"Dobry deň pán Novák poďte ďalej na kávičku, porozprávame sa."\r\nPo pol hodine rozhovoru.\r\n"Tak ja pomaly pôjdem pán doktor, dovidenia!"\r\n"A ozaj, ako sa darí vašej pani?"\r\n"Pre boha! Veď preto som prišiel, leží na zemi a dusí sa!"', 322, 3.2, 32),
	(6894, 'Žena u lekára po prehliadke:\r\n- Pán doktor, som vážne chorá?\r\n- Nie je to také zlé, ale ak sa chcete uzdraviť, mali by ste každý deň zjesť jedno vajce.\r\n- Viete pán doktor, ale keď ja vajíčka neznášam.\r\n- Vy ste mi dobre nerozumeli, ja som povedal, ZJESŤ nie ZNIESŤ!', 287, 3.04, 32),
	(6895, 'Počas operácie sa pýta jeden z lekárov:\r\n- Dokedy budeme ešte operovať, pán profesor? Veď z toho pacienta už skoro nič nezostalo...\r\n- Operovať? Tak my nepitveme?', 173, 3.03, 32),
	(6896, 'Babka u doktora:\r\n"Pán doktor, keď mám stolicu, tak sa mi hýbe v ústach zub."\r\n"Čo sa vám hýbe, zub? Pozrieme sa na to."\r\n"Babka, nabudúce, keď budete jesť španielske vtáčky, tak ten motúzik najprv odmotajte."', 224, 3.03, 32),
	(6897, 'U kožného:\r\n"Pán doktor, jeden môj známy ma podozrenie na pohlavnú chorobu."\r\n"Čo už s vami? Tak si stiahnite nohavice a ukážte mi toho známeho."', 156, 3, 32),
	(6898, 'V ordinácii:\r\n"Pane, vy budete potrebovať veľmi silné okuliare."\r\n"Ako ste to tak rýchlo spoznali bez vyšetrenia?"\r\n"To viete, profesionalita. A to som len gynekológ."', 174, 2.83, 32),
	(6899, '"Pán doktor, celé telo ma svrbí."\r\n"A skúšali ste kúpeľ?"\r\n"Skúšal. Tak týždeň - dva bolo dobre a potomto začalo zas."', 131, 3.01, 32),
	(6900, 'Pacient pred operáciou leží na operačnom stole.Operujúci lekár hovorí svojmu asistentovi:\r\n"Musíme mu amputovať pravú nohu."\r\n"Švac!"\r\n"Musíme mu amputovať pravú ruku."\r\n"Švac!"\r\n"Ruku!"\r\n"Švac!"\r\n"Pravú!"\r\n"Švac!"', 232, 2.89, 32),
	(6901, '"Pán doktor, zabúdam."\r\n"Od kedy?"\r\n"Čo od kedy?"', 52, 3.08, 32),
	(6902, 'Príde muž k doktorovi a hovorí:\r\n- Prosím vás, mňa už celé dva týždne tak strašne bolí hlava.\r\n- Fajčíte?\r\n- V žiadnom prípade!\r\n- Pijete?\r\n- Tak to už vôbec nie!\r\n- A čo hovoríte na ženy?\r\n- Ani mi nehovorte o tých hriešnych stvoreniach!!!\r\n- No, tak to asi máte silno utiahnutú svätožiaru...', 320, 2.78, 32),
	(6903, 'Hovorí sestrička:"Pán doktor ten simulant z trojky umrel."\r\nDoktor odpovedá:"No, ale tentoraz to prehnal."', 110, 3.17, 32),
	(6904, '- Pán doktor, skutočne si myslíte, že to moja žena prežije?\r\n- Áno, určite.\r\n- Preboha. Nepoznáte niekoho, kto by kúpil rakvu?', 136, 3.23, 32),
	(6905, 'Lekár na vizite hľadí do chorobopisu a mrmle si:\r\n"To je dobre, to je dobre."\r\nPacient sa pýta:\r\n"Čo je dobre?"\r\n"Že tu chorobu nemám ja."', 145, 3.12, 32),
	(6906, 'Výzva ministerstva zdravotníctva:\r\nDaruj srdce, daruješ život!', 66, 2.89, 32),
	(6907, '- Pán doktor,pred očami mi lietajú také malé, nejasné mušky.\r\nLekár predpíše pacientovi okuliare a prikazuje prísť o mesiac.\r\n- Tak ako,už je to lepšie?\r\n- Jasné,mušky sú oveľa vačšie a vidím ich zreteľne.', 227, 3.04, 32),
	(6908, 'V rodine kynológa sa narodili trojčatá. V pôrodnici ich priniesli ukázať štastnému otcovi. Ten ich chvíľu pozorne prezerá a potom hovorí:\r\n"Toho stredného nechajte."', 178, 3.1, 32),
	(6909, 'U lekára:\r\n- Pán doktor, kedy budem môcť začať znova so sexom? - pýta sa mladá slečna.\r\n- No tak to je veľmi obtiažne, pretože ste úplne prvá pacietka, ktorá sa ma na to pýta po operácii mandlí.', 212, 2.56, 32),
	(6910, '"Pán doktor, celé telo ma svrbí."\r\n"A skúšali ste kúpeľ?"\r\n"Skúšal. Tak týždeň-dva bolo dobre a potom to začalo zas."', 130, 3.76, 32),
	(6911, 'Pacient na psychiatrickom vyšetrení. Doktor mu namaľuje obdĺžnik:\r\n"Čo vám tento obrazec pripomína?"\r\n"To je posteľ. Keď si žena ľahne napríklad sem, tak muž si môže ľahnúť\r\nnapríklad sem."\r\nPotom doktor namaľuje krúžok:\r\n"A čo vám pripomína tento obrazec?"\r\n"Posteľ. Keby si žena ľahla takto, muž by si mohol ľahnúť takto."\r\nĎalej namaľuje doktor trojuholník. Ešte než stihne položiť svoju otázku, pozrie sa na neho pacient podozrievavo:\r\n"Doktor! Veď vy ste sexuálny maniak!"', 520, 2.84, 32),
	(6912, 'Chirurgia, koniec pracovnej doby. Doktor už sa prezlieka, keď príde pacient s vidličkou zapichnutou do brucha:\r\n"Prosím vás, pán doktor, pomôžte!"\r\n"Bohužiaľ, dnes to už nepôjde, končíme."\r\n"Pán doktor, veď pomôžte!"\r\n"Hovorím vám jasne, že už zavierame!"\r\n"Moc vás prosím, pomôžte mi."\r\n"Tak dobre."\r\nVytiahne mu vidličku z brucha, zapichne do oka a hovorí:\r\n"Choďte k očnému, tam majú dnes dlhý deň."', 437, 3.05, 32),
	(6913, 'V ordinácii:\r\n"Pane, vy budete potrebovať veeeľmi silné okuliare."\r\n"Ako ste to tak rýchlo spoznali bez vyšetrenia?"\r\n"To viete, profesionalita. A to som len gynekológ."', 176, 2.97, 32),
	(6914, 'Príde dedko k lekárovi a sťažuje sa na silnú bolesť v oblasti hrudníka. Lekár ho vyšetrí a stanoví diagnózu:\r\n- Dedko, veď vy ste prekonali infarkt. Pôjdete teraz domov a každý deň si budete dávať na prsia čerstvo vukopanú čiernu zem.\r\n- A vy si, pán doktor, myslíte, že to pomôže?\r\n- To neviem, ale zvykajte si.', 339, 3.05, 32),
	(6915, 'Chirurg povzbudzuje pacienta pred operáciou:\r\n"Nemusíte sa ničoho báť. Je to už moja šestnásta operácia, tak by sa konečne mohla podariť!"', 149, 3.19, 32),
	(6916, '- Pán doktor, za ten týždeň čo tu ste, ste zničili už tretí operačný stlô! Prosíme Vás, nabudúce, už nerežte tak hlboko.', 136, 3.13, 32),
	(6917, 'Sestrička sa pýta doktora:\r\n- Pán doktor, budeme pacienta liečiť, alebo ho necháme žiť?', 95, 2.87, 32),
	(6918, 'Pride montér na jednotku ARO, chvíľu si prezerá pacientov, všetci\r\nna prístrojoch, a potom hovorí:\r\n"Poriadne se nadýchnite, budem meniť poistky."', 155, 3.24, 32),
	(6919, 'Kto vykonal najviac pre rozvoj modernej chirurgie?\r\nRichard Jordan Gatlng - vynálezca guľometu.', 97, 2.61, 32),
	(6920, 'Koktavý hovorí lekárovi:\r\nPá pá pán do do dokk dokk tor čoo jjje to ppp ro ssta ta?\r\nLekár sa ne neho pozrie a hovorí:\r\n"Prostata je taká choroba keď niekto tak močí ako vy hovoríre.', 196, 3.1, 32),
	(6921, '"Pán doktor, strašne mi smrdí z úst."\r\nDoktor ho chvíľu prehliada a potom hovorí:\r\n"Máte dve možnosti: Buď si prestanete ohrýzať nechty, alebo si prestanete škrabať hemeroidy."', 190, 2.93, 32),
	(6922, 'Stretnú sa dvaja:\r\n"Prečo si taký neštastný?"\r\n"Ále, v noci sa pomočujem."\r\n"A bol si s tým u lekára?"\r\n"Áno, ale nepomohlo."\r\n"Tak skús psychoterapiu."\r\nPo týždni sa zase stretli, priateľ má očividne lepšiu náladu:\r\n"Tak čo, pomohla psychoterapia?"\r\n"Vidíš, pomohla!"\r\n"Takže už sa nepočúravaš?"\r\n"No, ešte sa počúravam, lenže už ma to nedeptá, ale som na to hrdý."', 399, 3.05, 32),
	(6923, '"Pán doktor, minule ste mi predpísali nejaké nové lieky!"\r\n"Podľa čoho tak usudzujete?"\r\n"Lebo tie staré, keď som ich vyhodil do záchodu, sa potopili, a tie nové plávajú."', 183, 3.25, 32),
	(6924, 'Pacient sa preberá po operácii a doktor sa ho pýta:\r\n"Ako sa cítite po operácii?"\r\n"Teraz už je to dobre, ale jednu chvíľu som mal pocit, ako by ma ovalili po hlave polenom."\r\n"A čo sme mali robiť, keď nestačila narkóza?"', 234, 2.95, 32),
	(6925, 'Chlap mal gangrénu na pravej nohe a lekár skonštatoval, že už sa nič nedá robiť, nedá sa vyliečiť, noha musí preč. Po operácii sa chlap preberie a nad ním stojí doktor a hovorí:\r\n- Mám pre vás zlú a dobrú správu. Tá zlá je, že máme novú sestru na operačkách. No, mala trému a tak prehodila snímky a doktor si to nevšimol. No proste sme vám odrezali ľavú a nie pravú nohu. Sorry.\r\n- A tá dobrá správa? - pýta sa pacient.\r\n- Neverili by ste, ako vám tá gangréna na pravej nohe ustúpila.', 528, 2.96, 32),
	(6926, 'Príde chlapík k doktorovi a hovorí: \r\n"Pán doktor, nejako sa zle cítim."\r\nTak doktor povie chlapovi:\r\n"Očúrajte mi prst!"\r\nChlap poctivo očúra, doktor prst oňuchá, oblíže a hovorí:\r\n"Zdá sa, že moč máte v poriadku. No dobre, tak vám skontrolujem stolicu. A strčí mu prst do zadku. Potom prst vytiahne, oňuchá, oblíže a hovorí:\r\n"Aj stolicu máte v poriadku. No dobre, tak otvorte ústa a urobte áááááá."\r\nChlap otvorí ústa, urobí áááá a doktor mu strčí ten očúraný prst do krku, načo sa chlap na mieste pozvracia. Tak doktor víťazoslávne prerečie:\r\n"No vidíte, žalúdok máte pokazený!"', 638, 3.15, 32),
	(6927, 'Príde chlap k doktorovi, a doktor mu predpíše čípky. Chlap príde domov, rozbalí čípky, pozerá na to, nevie čo to je, tak zoberie nôž, nareže ich na kolieska, k tomu si ufaklí kus chleba, nareže cibulu, vezme soľ, ocot a zje to. Ráno príde za doktorom a hovorí:\r\n"Pán doktor, už sa mi čípky minuli."\r\nA doktor na to:\r\n"Do frasa, chlape, však som vám včera jedny predpísal, to čo tie čípky jete?"\r\n"Nie, pchám si ich do zadku!"', 457, 3.11, 32),
	(6928, 'Ktorú vetu by ste nechceli počuť pri svojej operácii?\r\nPusti to ty zlý psíček.', 85, 3.02, 32),
	(6929, 'Vystrašená sestrička pribehne za doktorom a vraví mu:\r\n- Ten pacient, čo tu bol, zomrel v čakárni pri odchode!\r\n- Tak ho obráťte tak, aby to vyzeralo, že ešte len prichádzal.', 186, 2.85, 32),
	(6930, 'Príde chlapík ku doktorovi a hovorí:\r\n- Pán doktor, ja mám taký slabý tlak, že nedočúram ani na zem.', 110, 2.98, 32),
	(6931, 'Po ťažkej nehode sa pacient preberie na ARE. Pristúpi k nemu lekár a hovorí:\r\n- Mám pre vás dve správy. Jednu dobrú a jednu zlú. Ktorú chcete počuť ako prvú? \r\nVystrašený pacient vraví:\r\n- Tak hádam najskôr tú zlú.\r\n- Noo, museli sme vám amputovať obe nohy.\r\nPacient je v šoku a s nádejou v hlase sa spýta:\r\n- A ktorá je tá dobrá správa? \r\n- Noo, vidíte tú peknú sestričku? \r\n- Áno vidím.\r\n- Tak s tou som sa dnes v noci vyspal.', 464, 3.12, 32),
	(6932, 'Pacient zomrel a lekár takto jemne oznamuje pozostalej manželke túto smutnú udalosť: \r\n- Vážená pani, mám pre vás dve správy. Jednu dobrú a jednu zlú. Najprv vám poviem tú dobrú: Vysoké teploty vášho manžela už klesli.', 239, 3.32, 32),
	(6933, '- Pán doktor, zabúdam.\r\n- A odkedy?\r\n- Čo odkedy?', 52, 3.18, 32),
	(6934, 'Pacient sa zobudí v nemocnici:\r\n- Pán doktor, ako dopadla operácia?\r\n- Aký pán doktor? Ja som Svätý Peter.', 113, 2.98, 32),
	(6935, '- Pán doktor, prosím vás, pomôžte mi. Ja mám tak slabý tlak, že nedočúram ani na zem!', 95, 3.28, 32),
	(6936, 'Príde slečna k doktorovi a hovorí: \r\n- Pán doktor, ja mám asi vlka.\r\nDoktor jej nato: \r\n- No tak si odložte, vyzlečte sa od pol pása nadol a predklonte sa.\r\nDoktor pozerá odzadu na predklonenú slečnu zprava, potom zasa zľava a po chvíľke hovorí: \r\n- Neviem vám povedať, či to je vlk, ale pysky to má poriadne.\n', 329, 2.97, 32),
	(6937, 'Galantný lekár mladej pacientke:\r\n- Áno, máte teplotu 38,6 ale keby ste videli, ako vám to svedčí...', 107, 2.81, 32),
	(6938, 'Sestrička vezie pacienta:\r\n"Kam ma to veziete?"\r\n"Do márnice."\r\n"Ale veď ja som ešte neumrel!"\r\n"Však ešte nie sme v márnici."', 133, 2.93, 32),
	(6939, '- Pán doktor, som veľmi chorá?\r\n- Ani nie. Len tak na 800 až 1000 korún.', 77, 3.02, 32),
	(6940, 'Americky slovák prišiel na Slovensko do nemocnice a na chirurgickom oddelení zašiel za primárom oddelenia. \r\n"Mr.doctor, slovenský zdravotníctvo  na tom zle... myslím, že podporím vaše oddelenie... Urobíme biznis. Ja dám dolars..hmm...a vy za to ..mi odrežete odborne prirodzenie."\r\nStalo sa. Po operácii sa americký slovák prebral z narkózy a primár mu vraví:\r\n"Tak pane, urobili sme tu operáciu čo ste chceli."\r\n"Super, ja very rád. Dobrý biznis."\r\n"Ale pane, nechceli vy ste vlastne obrezať?"\r\n"Oh well, obrezať, to je ten správny výraz."', 569, 3.35, 32),
	(6941, '" Pán doktor, čo mám robiť, aby mi stáli prsia?"\r\n" Choďte po štyroch!"', 78, 2.85, 32),
	(6942, '- Pán doktor, prosím Vás, odrežte mi 4 cm z pohlavného údu.\r\nDoktor ho umŕtvi od pása dolu a odreže 4 cm.\r\n- Takto Vám to vyhovuje?\r\n- Nie, ešte mi odrežte 1 cm.\r\nDoktor ureže.\r\n- Takto to už bude dobré?\r\n- Nie, teraz prišite tie 4 cm nazad.\r\nDoktor prišije.\r\n- Prosím Vás a načo sme to všetko tak komplikovane operovali?\r\n- Pán doktor, práve v tom mieste sa mi ohýbal!', 393, 2.78, 32),
	(6943, 'Na urologickej operácii hovorí hlavný chirurg: \r\n- Sestra, popraviť vajcia.. Ohóó! A teraz pacientovi..', 109, 3.23, 32),
	(6944, '- Ja už mám konečne dvoch lekárov.\r\n- Načo sú ti preboha dvaja lekári?\r\n- Jeden má lieči a druhý mi robí dobre.', 122, 2.91, 32),
	(6945, 'Toľko chodila po lekároch, až sa stala striptérkou!', 55, 2.98, 32),
	(6946, '- Prečo ste zbili suseda?\r\n- Celé tri mesiace tajne choval v byte hydinu!\r\n- Zato ste ho nemuseli predsa mlátiť!\r\n- Ako to, že nie? Celé tri mesiace sa tlačím u psychiatra, lebo každé ráno počujem kikiríkať kohúta!', 229, 3.06, 32),
	(6947, 'Príde babka k lekárovi a hovorí mu:\r\n"Pán doktorko, mám hrozné bolesti, tu a tu aha."\r\nLekár sa na ňu pozrie a vyšetrí ju. Babka sa vyzvedá čo jej je, a pýta sa lekára na diagnózu. On jej hovorí:\r\n"Babka, každý deň si dávajte 3x na hruď studenú hlinu."\r\nBabka mu na to:\r\n"A prečo?"\r\n"Treba si zvykať, babka"', 331, 3.3, 32),
	(6948, 'Doktor v pôrodnici čakajúcemu oteckovi:\r\n- Gratulujem! Vaša žena práve porodila Vaše šieste dieťa.\r\n- Hádam piate, nie?\r\n- Aj to, aj to...', 148, 2.9, 32),
	(6949, 'Rozprávajú sa dvaja:\r\n"To si počul, že o 7 rokov sa má vrátiť socializmus?"\r\n"Mňa nenaštveš, ja mám rakovinu."', 121, 3.14, 32),
	(6950, 'Blázon naháňa doktora so sekerou v ruke. Upachtený doktor zabehne do slepej uličky a nezostáva mu nič iné, ako sa pozerať na pribiehajúceho blázna a čakať na smrť. Blázon pribehne, pozerá sa doktorovi do očí a zrazu  povie:\r\n"Tu máš sekeru a teraz ma naháňaj ty!"', 285, 3.17, 32),
	(6951, '- Pán doktor, rastú mi chlpy na prsiach!\r\n- A pokiaľ ich až máte, milostivá pani?\r\n- Až po gule.', 103, 3.11, 32),
	(6952, 'Príde cigánka za gynekológom a vraví.\r\n- Pán doktor ja mám vlka.\r\nDoktor jej vraví.\r\n- Predklonte sa pozrieme sa na to.\r\nCigánka sa predkloní a doktor vraví.\r\n- No na vlka to nevyzerá, ale pysky to má riadne.', 220, 3.19, 32),
	(6953, 'Pomýli sa raz lekár pri vyplňovaní dotazníku a do kolonky "príčina smrti" napísal svoje meno.\r\n- Aspoň že raz napíše pravdu - uškrnul sa patológ. ', 160, 3.18, 32),
	(6954, 'Príde pacient k doktorovi s problémom, že sa mu nemôže postaviť. Doktor mu predpíše lieky a nech príde za týždeň na kontrolu. Pacient príde smutný a hovorý:\r\n"Doktor, nezaberá to." \r\nDoktor sa rozhodne, že mu pripne na prirodzenie elektródy a pustí mu tam 5 voltov.\r\nDoktor: "Stojí?"\r\nPacient: "Nestojí."\r\nPustí mu tam 10 voltov.\r\nDoktor: "Stojí?"\r\nPacient: "Nič, pán doktor ani sa nehne."\r\nPustí mu tam 50 voltov.\r\nDoktor: "Tak čo, už stojí?"\r\nPacient: "Nestojí, pán doktor, nestojí!"\r\nDoktor sa napáli a pustí mu tam 220 voltov.\r\nDoktor: "Tak čo, stojí?"\r\nPacient: "Nie, ale krásne svieti!"', 629, 3.16, 32),
	(6955, 'Hovorí pacient doktorovi v nemocnici:\r\n- Pán doktor, nemôžem dýchať nosom!\r\n- Tak dýchajte ústami - odpovedá doktor. \r\n- Ďakujem, pán doktor, veľmi ste mi pomohli.\r\n- Neďakujte,  bude to tristo korún.', 214, 2.95, 32),
	(6956, 'Pacient sa pýta:\r\n- Pán doktor, koľko času mi ešte zostáva?\r\nA doktor hovorí:\r\n- Trvanlivé mlieko už nemusíte kupovať.', 129, 2.86, 32),
	(6957, 'Príde chlapík k lekárovi a vraví:\r\n"Mám problém so žalúdkom."\r\nLekár ho vyšetrí a hovorí:\r\n"No to je jasné, to máte zo stravy."\r\n"Cha, tak to ste úplne vedľa, ja som v Ostrave nikdy nebol."', 205, 3.18, 32),
	(6958, 'Chlapíkovi zomrela manželka, no on až potom zavolá doktora. Doktor mu hovorí:\r\n- Preboha človeče, prečo ste ma nezavolali skôr? Azda vám nehovorila, že jej je zle?\r\n- No hej, čo by nehovorila. Ale tak som si pomyslel, komu je dnes dobre?', 249, 3.04, 32),
	(6959, 'Pride chlapík k lekárovi a lekár mu vraví,\r\n- Vy máte ale červené oči, to musite ale riadne slopať, koľto toho vlastne vypijete?\r\n- No, stane sa na deň, že aj litrík, možno dva, výnimočne tri.\r\n- Pozerám, že máte žlté palce, koľko toho vlastne vyfajčíte?\r\n- Ále, tak 10, niekedy 20, výnimočne 35 deňne.\r\n- A koľko krát sa milujete?\r\n- No tak 2-3 krát do mesiaca, niekedy 5, výnimočne 7.\r\n- Vidíte, vidíte, Vaša životospráva má negatívny vplyv na Váš sexuálny život.\r\n- Ále pán doktor, čo by ste chceli od obyčajného, dedinského farára ?!', 588, 3.15, 32),
	(6960, '- Akú mám šancu, pán doktor? \r\n- Stopercentnú. Viete, taká operácia sa podarí na každom desiatom a pred vami deviati zomreli.', 134, 2.9, 32),
	(6961, 'Lekár poučuje nastávajúceho otca:\r\n- S vašou tehotnou ženou sa môžete milovať, ale odporúčam vlčiu polohu.\r\n- A to je aká?\r\n- Ľahnúť si vedľa diery a zavýjať.', 177, 2.77, 32),
	(6962, 'Pacient na urológii: \r\n- Viete, pán doktor, to je chúlostivá vec.\r\n- No tak von s ňou.\r\n- Ale keď ja sa strašne hanbím, lebo sa mi budete smiať. \r\n- Ja som už vo svojej praxi videl všeličo, takže ukážte.\r\n- Keď ja mám jedno varla väčšie ako to druhé, také obrovské.\r\n- Tak sa už vyzlečte.\r\n- Ale vy sa mi budete smiať.\r\nDoktor sa nahnevá a skríkne: \r\n- Vyzlečte sa!\r\nPacient si stiahne trenírky a ukazuje doktorovi varla veľké ako volejbalka. Doktor od smiechu padne zo stoličky. Pacient len smutne rečie:\r\n- Čo som vám vravel, že sa budete smiať a toto je ešte to menšie.', 612, 2.95, 32),
	(6963, '- Ste unavený, mali by ste chodiť spať so sliepkami. \r\n- Už som to skúšal, pán doktor, ale za nič na svete neviem udržať rovnováhu na bidielku.', 154, 3.01, 32),
	(6964, 'Pacient sa pýta doktora:\r\n"Pán doktor, ako mi pracuje srdce?"\r\nDoktor mu na to:\r\n"Po pitve budeme múdrejší."', 113, 3.1, 32),
	(6965, 'Príde muž k doktorovi a hovorí:\r\n- Pán doktor, mám hnačku.\r\nDoktor mu napísal na skúšku ukľudňujúce lieky. O týždeň prišiel pacient na kontrolu a doktor sa ho pýta:\r\n- Stále máte hnačku?\r\nMuž odpovedá:\r\n- Mám, no a čo.', 242, 2.72, 32),
	(6966, 'Príde muž k doktorovi a sťažuje sa:\r\n- Pán doktor, každý deň, keď prídem domov, moja žena je v posteli s cudzím chlapom. Chcem vyvolať škandál, ona mi povie, aby som sa ukľudnil a dal si šálku kávy, no a takto ide každý deň.\r\n- No a čo vlastne chcete odo mňa?\r\n- No, ja len či mi neuškodí toľko kávy.', 329, 2.88, 32),
	(6967, 'Dracula u zubára:\r\n- Len nabrúsiť, prosím, len nabrúsiť!', 62, 2.77, 32),
	(6968, 'Príde starý pán k lekárovi a hovorí:\r\n- Pán doktor strašne mi slzá oči.\r\nDoktor mu pozerá do očí no nevidí nič z čoho by to mohol mať. Ten starý pán ho začne navigovať:\r\n- Viete, to mi vyráža niekde z chrbta, potom to ide taďálto - ukazuje na brucho - a končí mi to až tu v riti.\r\n- No nič sa nedá robiť, stiahnite si nohavice a zistíme, že z čoho to máte.\r\nPán si stiahne nohavice a doktor sa z vypúlenými očami pozerá a krúti hlavou:\r\n- To je hrozné čo vy tu máte. Veď tu vám visia nejaké brmbolce.\r\n- No veď práve. Ja keď si tie brmbolce trhám tak mi hrozne slzá oči.', 622, 3.03, 32),
	(6969, 'Muž u lekára.\r\nMuž:"Pan doktor, všetci ma ignorujú."\r\nLekár:"Ďalší prosím."', 85, 3.17, 32),
	(6970, '- Áno, som schizofrenik. Ale narozdiel odo mňa si to priznávam!', 66, 3.09, 32),
	(6971, 'Príde žena k psychiatrovi a sťažuje sa:\r\n- Pán doktor, môj muž stále, keď dopije kávu zje aj pohár a nechá len uško. Nie je to nejaké divné?\r\nDoktor:\r\n- Tak to je voľajaké divné, pretože ja mám uška najradšej.', 231, 3.04, 32),
	(6972, 'Príde doktor so samopalom k pacientovi a hovorí: \r\n- Tak toto je posledná dávka, ktorú vám je ochotná preplatiť vaša poisťovňa.', 138, 3.01, 32),
	(6973, 'Chodí dedko po nemocnici a mrmle si: \r\n- Žabu? Hm, nie, žabu nie. Mloka? Hm, nie, mloka nie. \r\nIde okolo sestrička a hovorí mu: \r\nRaka máte, dedo, raka!', 158, 2.9, 32),
	(6974, 'Príde chlapík k psychiatrovi celý vystrašený a hovorí:\r\n- Pán psychiater, ja mám stále pocit, že po mne lezú šváby!\r\n- Ale choďte niekam! Nehádžte ich po mne!', 174, 3.17, 32),
	(6975, 'Na nebeskú bránu klope muž a strašne sa rehoce. Otvorí mu Svätý Peter:\r\n- Čo sa, preboha, tak smejete?\r\n- Ale, dole ma operujú a ja som už tu!', 152, 3.09, 32),
	(6976, 'Pri pôrode doktor kričí:\r\n- Ešte viac! Zaberte! Tlačte! No! Do toho!\r\nOna pridá, zaberie naplno a zrazu BUUUM. Doktor: \r\n- Tak a teraz si ho choďte nájsť!', 163, 2.95, 32),
	(6977, '- Pán doktor, nevidím do diaľky. \r\nLekár vezme pacienta za ruku, privedie ho k oknu, ukáže na oblohu a spýta sa: \r\n- Čo vidíte? \r\n- Slnko. \r\n- Výborne. A teraz mi povedzte, kam ďalej by ste ešte chceli vidieť?', 222, 3.04, 32),
	(6978, '"Pán doktor, čo mi je?"\r\n"Neviem, to ukáže pitva."', 54, 3.14, 32),
	(6979, 'Dvaja pacienti po čerstvej operácii sa rozprávajú.\r\n- Máme šťastie. Ani by si netušil, akí sú tí doktori nepozorní a roztržití. Jeden pacient musel dvakrát na chirurgiu, lebo mu do brucha omylom zašili nožnice...\r\nZrazu sa rozletia dvere a do miestnosti vojde hlavný chirurg\r\n- Nevidel niekto moje rukavice?', 325, 2.8, 32),
	(6980, '- Pán doktor, mám strašne slabú pamäť.\r\n- A odkedy?\r\n- Čo odkedy?', 72, 3.44, 32),
	(6981, '- Pán doktor, ja mám tridsaťdva zubov.\r\n- Ale veď to je normálne, každý má tridsaťdva zubov.\r\n- Dobre, ale ja mám všetky hore!', 137, 2.9, 32),
	(6982, 'Príde pacient k doktorovi a vraví:\r\n- Pán doktor, ja mám strašný problém. Každé ráno o štvrtej mám stolicu. \r\n- To je dobre - vraví doktor. \r\n- Ale ja sa budím o šiestej. ', 186, 3.11, 32),
	(6983, 'Príde pacient k doktorovi a vraví: \r\n- Nijako nedokážem prestať fajčiť.\r\n- A s cukríkmi ste to už skúšali?\r\n- Hej, ale slabo horia.', 142, 3.31, 32),
	(6984, 'Príde kostra k zubárovi na prehliadku a zubár vraví:\r\n- Tie zuby sú pekné, ale tie ďasná...', 99, 3.19, 32),
	(6985, '"Pán doktor, som homosexuál"\r\n"Ách, bože, a ja som taký neučesaný!"', 74, 3.29, 32),
	(6986, 'Bacil sa pýta bacila. \r\n- Ako sa máš?\r\n- Dobre. A Ty?\r\n- Zle. Práve som dostal acilpirín.   ', 97, 3.21, 32),
	(6987, '"Pán doktor ja sa tak strašne bojím toho plombovania, že by som radšej rodila."\r\n"No tak si to ale rýchlo rozmyslite, lebo práve nastavujem kreslo..."', 157, 3.23, 32),
	(6988, 'Pacient počíta na lôžku: \r\n"3623, 3624, 3625 ..."\r\nPríde k nemu lekár a vraví:\r\n"Pane po operácii už nemusíte rátať."', 129, 3.29, 32),
	(6989, 'Príde pacient ku doktorovi, doktor mu hovorí:\r\n- Máte AIDS.\r\n- A to na to nie je liek?\r\n- Dávajte si hlinu na hrudník.\r\n- A pomáho to?\r\n- Nie, ale zvykajte si.', 165, 3.16, 32),
	(6990, 'Lekár hovorí pacientke:\r\n- Na vašu chorobu je jediný liek. Denne musíte zjesť jedno vajce.\r\n- Ale ja vajcia neznášam.\r\n- Však ja hovorím zjesť a nie zniesť.               ', 183, 3.64, 32),
	(6991, 'Záhorák je v Anglicku strašne ho rozbolý zub. Ide teda k zubárovy, ukáže na zub a povie: "TU". Zubár mu ihneď vytrhne dva zuby. Záhorák sa ide sťažovať ku kamošovy. "A ty nevieš, že "TU" je po anglicky dva? Poučený záhorák ide opäť k zubárovy ukáže na zub a povie: "TEN"              ', 310, 3.75, 32),
	(6992, 'Po dôkladnej zdravotnej prehliadke a viacerých vyšetreniach vysvetlil doktor svojej pacientke, že jej zostáva už len necelý deň života. Pani príde domov a hovorí svojmu manželovi:\r\n"Keď je to tak, tak by som chcela, aby sme sa celú poslednú noc divoko milovali."\r\nManžel odpovedá:\r\n"Tebe sa to ľahko hovorí, keď nemusíš ráno vstávať."              ', 373, 3.83, 32),
	(6993, 'Zdravotná sestra sa nakloní nad posteľ a vraví pacientovi:\r\n"Až príde lekár, povedzte mu niečo povzbudzujúce, lebo váš zdravotný stav mu robí veľké starosti."              ', 187, 3.83, 32),
	(6994, 'Čo robí patológ, keď sa prechádza po cintoríne?\r\nRobí inventúru.              ', 86, 3.67, 32),
	(6995, 'Vbehne chlapík k lekárovi, oči vypúlené a volá:\r\n"Doktor, pomôžte mi, nechce mi stáť!"\r\nLekár si vyhrnie rukávy a zreve:\r\n"A koho by si tu chcel pretiahnuť?!"              ', 185, 3.5, 32),
	(6996, 'Pýta sa psychológ pacientky:\r\n"Netrpel u vás niekto gigantomániou?"\r\n"Ale áno! Môj manžel občas vyhlási, že je hlavou rodiny."              ', 150, 3.33, 32),
	(6997, '"Pán doktor, som duševne chorý..."\r\n"Ako sa to prejavuje?"\r\n"Považujem za rozumné všetko, čo povie moja žena..."              ', 134, 3.83, 32),
	(6998, 'Pacient v blázinci vášnivo píše.\r\n"Tak, čo pekného píšeme?" pýta sa ho žoviálne primár na vizite.\r\n"Píšem list sám sebe."\r\n"A čo v ňom bude?"\r\n"Ako to mám vedieť, keď ho dostanem iba zajtra?"              ', 226, 4, 32),
	(6999, 'U urologa:\r\n- Sestrička, chyťte penis...\r\n- Ohoho, a teraz pacientovi...              ', 88, 4.07, 32),
	(7000, 'V ordinácii vysvetľuje lekár mužovi:\r\n- Vaša manželka trpí chorobou látkovej výmeny.\r\n- Je mi to jásné.Preto chce mať každú chvíľu nové oblečenie.              ', 178, 2.6, 32),
	(7001, 'Aký ja najdlchší jedálenský príbor?    \r\nInfúzia              ', 69, 3.33, 32),
	(7002, '"Čo pijete?"  pýta sa doktor pacienta.\r\n"A čo máte, pán doktor?"              ', 83, 3.5, 32),
	(7003, 'Ide dedko k lekárovi a lekár mu hovorí:\r\n- Dedko, do konca svojho života už nemôžete nič jesť!\r\n- Pán doktor a vydržím to?\r\n- Snáď tie dve-tri hodinky vydržíte. No nie?              ', 198, 3.67, 32),
	(7004, 'K lekárovi príde muž, ktorému na hlave sedí obrovská odporná ropucha. \r\n"Preboha, ako sa vám to stalo?" pýta sa doktor. \r\n"Neviem, začalo to ako pupák na zadku," odpovie ropucha.\r\nJasná odpoveď\r\n"Pán doktor, čo mám robiť? Na určitých miestach stále priberám."\r\n"Tak na tie miesta nechoďte!"\n', 313, 3.4, 32),
	(7005, '- Sanitár, čo mi to sem vozíte?!! Minule sa to bránilo pri pitve!\r\nPacient počíta na lôžku:\r\n- 3623, 3624, 3625 ...\r\nPríde k nemu lekár a vraví:\r\n- Pane, po operácii už nemusíte rátať.              ', 214, 2.67, 32),
	(7006, 'Dvaja patológovia sa rozprávajú na Silvestra:\r\n"Tak čo? Otvoríme toho Huberta?"              ', 98, 3.78, 32),
	(7007, 'Muž príde za doktorom a povie: \r\n"Pán doktor, myslím, že moja žena je už asi dva týždne mŕtva." \r\n"A ako ste na to, prosím vás, prišli?!" \r\n"No, sex je úplne rovnaký, ale začal sa mi hromadiť \r\nv kuchyni špinavý riad..."\r\n„Pán doktooor, pán doktooor, prečo si nemôžem nahmatať nohy?“\r\n„Vy idiot, lebo sme vám amputovali ruky!“              ', 374, 2.75, 32),
	(7008, 'Príde pacientka k lekárovi a hovorí:\r\n „Pán doktor, už mi umrela posledná filcka.“ \r\nA pán doktor na to: „No a čo, tak sa radujte, aspoň ste zdravá a čistá, nie?“ \r\nA pacientka vraví: „No áno, ale viete koľko ich prišlo na jej pohreb?!“              ', 278, 3.67, 32),
	(7009, '„Pán doktor, musím sa vám s niečím zveriť. Mám ho ako novorodenec.“ \r\n„To je veľmi nepravdepodobné. Dajte si dole nohavice... Skutočne! Tri kilá a štyridsať päť centimetrov!“              ', 211, 3.33, 32),
	(7010, 'Príde matka s dcérou k lekárovi \r\na hovorí: \r\n"Pán doktor, nepozreli by ste sa na moju dcéru, prečo má tak vytreštené oči?" \r\nDoktor si ju prezrie a hovorí: \r\n"Povolte jej gumičku vo vlasoch."              ', 219, 3.8, 32),
	(7011, 'Babička sa pýta pána doktora: \r\n"Pán doktor, akže sa to volá ten Nemec, čo mi stále doma schováva veci?" \r\n"Alzheimer, babička, Alzheimer..."              ', 165, 3.17, 32),
	(7012, 'Pán doktor, čo mi je? \r\nTo ukáže až pitva.              ', 61, 3, 32),
	(7013, 'Príde sestrička ku lekárovi a pýta sa ho: ,,Pán Doktor ako dopadla operácia?" To bola operácia ja som myslel že to bola pitva.              ', 148, 3.5, 32),
	(7014, 'Po roku od promócie sa stretnú dvaja bývalí spolužiaci:\r\n"Človeče, keď pomyslím na to, aký som ja inžinier, tak sa normálne \r\nbojím ísť k lekárovi..."\n', 167, 3.9, 32),
	(7015, '-Pán doktor, operáciu toho černocha z izby 23 musíme odložiť.\n-Prečo?\n-Minuli sa nám čierne niťe.              ', 121, 4, 32),
	(7016, 'Doktor hovorí: amputujte mu pravú nohu! bzzzm...pravú! bzzzm...nohú!              ', 86, 3, 32),
	(7017, '”Pán doktor, čo mám robiť, aby som neotehotnela?”\r\n”Už nič, váš manžel sa dal u nás včera sterilizovať.”\r\n”No veď práve preto sa pýtam...”              ', 179, 3.57, 32),
	(7018, '-Dobrý deň, pán pacient, ako sa máte?\r\n-V celku dobre, pán doktor, akurát po tej srdečnej operácii zvraciam.\r\n-Hm... Choďte si ešte chvíľu ľahnúť, možno to prejde.\r\nKeď pacient odíde, lekár si zašomre:\r\n-Vedel som, že toho pacienta budeme musieť operovať znovu. A dať ten sprostý kardiostimulátor zo žalúdka do srdca !              ', 360, 3.38, 32),
	(7019, 'Študenti na medicíne majú hodinu anaomie a práve preberajú amputácie. Jedna študentka je dotázaná na amputáciu penisu.\r\n"No tak najprv by som skalpelom odrezala tkáň a potom by som pilkou prerezala kosť…"\r\nOd pána profesora dostala následujúcu radu:\r\n"Na medicínu, na tu sa slečna vykašlite, ale toho chlapca, toho sa držte…"              ', 363, 3.75, 32),
	(7020, 'Stretnú sa lekári na pohrebe kolegu - kardiológa. Po smútočnom obrade v krematóriu vchádza rakva do veľkého červeného srdca, keď tu sa náhle jeden z prítomných začne šialeným spôsobom smiať.\r\n"Prečo sa smejete?", pýtajú sa ho ostatní.\r\n"Já som gynekológ a zaujímalo by ma, kam pôjde moja rakva…"              ', 339, 4, 32),
	(7021, 'Žena príde k doktorovi kvôli svojej hormonálnej liečbe. Doktor si hneď všimne, že jej vo výstrihu rastú chlpy a pýta sa:\r\n-Hmmm ... zdá sa, že vám chlpatie hrudník. Ako ďaleko to ide?\r\n-No, až dole na gule, ale to je vlastne ďalšia vec, o ktorej som\r\nchcela s vami hovoriť!              ', 307, 3.87, 32),
	(7022, '"Pán doktor, na určitých miestach neustále priberám, čo mám robiť?"\r\n"Tak na tie miesta radšej nechoďte."              ', 129, 3.8, 32),
	(7023, 'Doktor pri vizite ukazuje skupine mladých začínajúcich lekárov rontgenovú snímku.\r\n"Ako vidíte, pacient kríva, pretože má značne zakrivenú lýtkovú i holennú kosť. Michal, čo by ste robili v takomto prípade?"\r\n"No," odpovie zadumaný mladý lekár, "myslím, že aj ja by som kríval."              ', 317, 4.2, 32),
	(7024, '"Tak neviem, pán Konečný." hovorí lekár\r\na odkladá fonendoskop.\r\n"Buď slabo počujem, alebo ste mŕtvy!"              ', 125, 3.75, 32),
	(7025, '"Pán doktor, niektorí lekári predpíšu lieky napríklad na zápal pľúc a pacient potom zomrie na niečo úplne iné. To sa vám nestane, že nie?"\r\n"Nemajte strach. Keď vám JA predpíšem lieky na zápal pľúc, tak zomriete na zápal pľúc!"              ', 265, 3, 32),
	(7026, 'Prišla pani k súkromnému doktorovi, ktorý mal v ten deň zrovna blbú náladu, a tak, keď ju prezrel, prehlásil na adresu jej bolestí:\r\n"No, budete sa musieť naučiť s tým žiť."\r\nKeď jej potom prišiel účet na 350 korún, poslala ho späť s poznámkou:\r\n"Budete sa musieť naučiť žiť bez toho."              ', 328, 4, 32),
	(7027, '"Pán doktor, príďte rýchlo, moja žena má zápal slepého čreva."\r\n"Blbosť, vlani som jej ho vyoperoval. Počuli ste o niekom, kto by mal druhé slepé črevo?"\r\n"A vy ste doktor nepočul o nikom, kto by mal druhú ženu?"              ', 243, 3.14, 32),
	(7028, '"Doktor mi sľúbil, že do týždňa ma postaví na nohy."\r\n"A? Ako si dopadol?"\r\n"Mal pravdu, včera som musel predať auto a zaplatiť účty."              ', 160, 4, 32),
	(7029, 'U psychiatra:\r\n”Slečna, a s tými antidepresívami opatrne. Neberte to na ľahkú váhu.”\r\n”Tak tie kilá som pol roka zhadzovala zbytočne?”              ', 164, 3.33, 32),
	(7030, '”A kedy vás to najviac bolí?” pýta sa lekár.\r\n”Keď dýcham.”\r\n”Tak ostaňte tri dni doma a nedýchajte. Potom sa príďte ukázať.”              ', 163, 3.5, 32),
	(7031, 'U lekára:\r\n”Pani, prosím vás, vyzlečte sa!”\r\n”A kam si môžem dať šaty?”\r\n”Vedľa mojich.”              ', 123, 3.78, 32),
	(7032, 'Po narkóze sa preberie pacient a pýta sa:\r\n”Pán doktor, ešte žijem?”\r\n”Čo ja viem, ale tie krídla sú nejaké podozrivé.”              ', 151, 3, 32),
	(7033, '”Pán doktor, ako prebehla operácia?”\r\n”Dobre, vaše slepé črevo opäť vidí!”              ', 104, 3.56, 32),
	(7034, 'Lekár poučuje pacienta: \r\n”Tak, a od zajtra žiadny alkohol, žiadne ženy a žiadne nákupy.”\r\n”A to už prečo, pán doktor?”\r\n”Aby ste mali peniaze na účet, ktorý vám vystavím!”              ', 213, 3.4, 32),
	(7035, 'Psychiater hovorí pacientke:\r\n”Potrebujete predovšetkým rozptýlenie, pani.”\r\n”Ale to nie je možné, pán doktor. Môj manžel je veľmi žiarlivý.”              ', 175, 3.75, 32),
	(7036, 'Pri pôrode lekár kričí:\r\n”Ešte viac, viac, tlačte! No, do toho!”\r\nTak rodička ešte pridá, zatlačí a zrazu buum! Lekár na to:\r\n”Tak, a teraz si ho choďte nájsť!”              ', 197, 3.5, 32),
	(7037, 'Jeden hluchonemý pán našiel v novinách inzerát:\r\n”Naučíme hluchonemých hovoriť. Trojtýždňový kurz, garantované výsledky!”\r\nRozhodol sa, že to skúsi. Dostavil sa na miesto, zaplatil a vošiel do ordinácie. Lekár mu znakovou rečou vysvetlil, aby sa postavil rozkročmo, ruky dal k telu a zavrel oči. Keď to pán urobil, lekár sa zahnal a poriadne ho kopol do rozkroku.\r\n”Áaaaaaaaaaaaaaaaa!” zreval muž.\r\nLekár sa usmial a vraví:\r\n”Krásne! Príďte zajtra, naučíme vás B!”              ', 526, 3.5, 32),
	(7038, 'V ordinácii:\r\n”Pán doktor, nemôžem piť, čo mám robiť?”\r\n”Dajte to sem, ja to vypijem!”              ', 116, 3.67, 32),
	(7039, 'Hovorí lekár v ordinácii pacientovi:\r\n”Na vašu nespavosť vám dám také lieky, že po nich  zaspíte ako keď vás do vody hodia.”\r\n”To nerobte, pán doktor.”\r\n”A prečo nie?”\r\n”Ja vôbec neviem plávať!”              ', 241, 4, 32),
	(7040, 'U lekára:\r\n”Prečo pijete?”\r\n”Pretože trpím,”\r\n”Ako?”\r\n”Zle chodím.”\r\n”A prečo?”\r\n”Pretože mám ploché nohy a zem je guľatá.”              ', 172, 3.56, 32),
	(7041, 'V ordinácii:\r\n”Pán doktor, môj muž si myslí, že je kôň.”\r\n”Tak to ho priveďte, ja ho vyliečim!”\r\n”Dobre pán doktor, ale až keď skončí dostihová sezóna, on začal teraz vyhrávať.”              ', 223, 3.5, 32),
	(7042, 'Žena u lekára:\r\n”Pán doktor mám problém, vždy keď si zapálim dostanem chuť na sex.”\r\n”Hmm, to je na dlhšiu debatu. Najprv si hádam zapálim.”              ', 174, 3.88, 32),
	(7043, '”Som tu dobre, na ušnom?”\r\n”Čožéé?”\r\n”Hmm. Som tu dobre.”              ', 88, 3.67, 32),
	(7044, 'Pán doktor, kde presne nájdem bod G?”\r\n”V treťom riadku medzi klávesami F a H.”              ', 103, 2.71, 32),
	(7045, '-Pán doktor, čo znamená to Č.H.V. v kolónke ”diagnóza”?\r\n-”Čert Ho Vie.”              ', 101, 3, 32),
	(7046, 'U zubára:\r\n”Pane, oba tie zuby máte v takom zlom stave, že bude najlepšie ich vytiahnuť.”\r\n”A koľko to bude stáť?”\r\n”1 500 korún.”\r\n”Čo?! Toľko peňazí za 2 minúty roboty?”\r\n”Keď si to budete želať, môžem ich vyťahovať aj pomaličky.”              ', 288, 3.25, 32),
	(7047, 'Doktor, doktor, mám už iba 59 sekúnd života!\r\nOh, počkajte minútku.              ', 87, 3.4, 32),
	(7048, 'U lekára:\r\n”Pán doktor, prečo mám také zlé výsledky?”\r\n”A koľko ste zaplatili?”\r\n”Päťsto korún.”\r\n”To sa nečudujte. Dobré výsledky stoja minimálne dve tisícky...”              ', 208, 3.67, 32),
	(7049, 'Lekár vraví pacientovi:\r\n”Mám pre vás dve zlé správy.”\r\n”Po prvé máte rakovinu a po druhé máte veľmi ťažkú sklerózu.”\r\nPacient na to:\r\n”No, aspoň, že nemám rakovinu.”               ', 211, 3.57, 32),
	(7050, 'Lekár hovorí pacientke:\r\n"Na vašu chorobu je jediný liek. Denne musíte zjesť jedno vajce."\r\n"Ale ja vajcia neznášam." "Však ja hovorím zjesť a nie zniesť."\n', 168, 4, 32),
	(7051, 'Na konci prehliadky sa pacient pýta lekára:\r\n”Pán doktor, tak ako je to s mojím zdravím? Môžem si dovoliť to povestné - ženy, víno, spev?”\r\n”Spievať ešte môžete.” odpovedá lekár.               ', 218, 3.2, 32),
	(7052, 'Dedinský lekár je vášnivým poľovníkom. Raz po poľovačke sa ho manželka pýta:\r\n”Tak čo, mal si dnes úspech?”\r\n”Ja som spokojný,” vraví lekár, ”dva zajace a štyria noví pacienti.”              ', 221, 3.67, 32),
	(7053, 'U zubára:\r\n”Tak, najprv vytrhneme zuby múdrosti. Aj tak sa neosvedčili.”              ', 93, 3.5, 32),
	(7054, 'U lekára:\r\n”A čo vaša pamäť? Zlepšuje sa, zlepšuje?”\r\n”A kto ste, že vás to tak zaujíma?”              ', 121, 4.03, 32),
	(7055, 'Primár vyčíta pacientovi:\r\n”Ako je možné, že ste utiekli z operačnej sály???”\r\n”Pretože sestra vravela: ´Len pokoj, operácia slepého čreva je jednoduchá záležitosť. To zvládnete.´”\r\n”Veď to je pravda.”\r\n”Ale ona to hovorila chirurgovi!”              ', 286, 3.7, 32),
	(7056, 'U očného:\r\n”Pán doktor, nevidím do diaľky.”\r\nLekár vezme pacienta za ruku, privedie ho k oknu, ukáže na oblohu a spýta sa:\r\n”Čo vidíte?”\r\n”Slnko.”\r\n”Výborne. A teraz mi povedzte, kam ďalej by ste ešte chceli vidieť?”              ', 261, 3.33, 32),
	(7057, '\r\nU lekára:\r\n”Nie som si veľmi istý diagnózou, pán Novák, ale pravdepodobne to bude z nadmerného požívania alkoholu.”\r\n”Dobre, pán doktor. Ja prídem zajtra, keď budete triezvy.”              ', 211, 4.17, 32),
	(7058, 'Príde pacient k doktorovi:\r\n”Pán doktor, ja som strašne nervózny.”\r\n”A prečo?”\r\n”Čo prečo, čo prečo!!!”              ', 138, 3, 32),
	(7059, 'V ordinácii.\r\n”Pán doktor, všetci ľudia mi hovoria, že som klamár.”\r\n”Neverím vám.”              ', 113, 3.92, 32),
	(7060, 'Lekár sa prechádza po cintoríne a spomína:\r\n”Túto som operoval, tohto som operoval, aj tohto som operoval...”              ', 132, 3.75, 32),
	(7061, 'Pacient sa preberá po operácii a doktor sa ho pýta:\r\n”Ako sa cítite po operácii?”\r\n”Teraz už je to dobre, ale chvíľu som mal pocit, ako by ma ovalili po hlave polenom.”\r\n”A čo sme mali robiť, keď nestačila narkóza?”              ', 254, 3.75, 32),
	(7062, 'U psychiatra:\r\n”Odkedy si myslíte, že ste princ?”\r\n”Odkedy nie som žaba.”              ', 98, 3.54, 32),
	(7063, 'V ordinácii:\r\n”Pán doktor, minule ste mi predpísali nejaké nové lieky!”\r\n”Podľa čoho tak usudzujete?”\r\n”Lebo tie staré, keď som ich vyhodil do záchodu, sa potopili a tie nové plávajú.”              ', 223, 2.67, 32),
	(7064, 'U očného:\r\n”Pán doktor, pred očami mi lietajú také malé nejasné mušky.”\r\nLekár predpíše pacientovi okuliare a prikazuje prísť o mesiac.\r\n”Tak ako, už je to lepšie?”\r\n”Jasné, mušky sú oveľa väčšie a vidím ich zreteľne.”              ', 269, 3.6, 32),
	(7065, 'Príde pacient k doktorovi.\r\n”Dobrý deň, pán doktor, ako sa dnes máme?”\r\n”Dobrý deň, pán Novák, poďte ďalej na kávičku, porozprávame sa.”\r\nPo pol hodine rozhovoru:\r\n”Tak ja pomaly pôjdem pán doktor, dovidenia!”\r\n”A ozaj, ako sa darí vašej pani?”\r\n”Pre boha! Veď preto som prišiel, leží na zemi a dusí sa!”               ', 362, 3.33, 32),
	(7066, 'Koktavý hovorí lekárovi:\r\n”Pá pá pán do do dokk dokk tor čoo jjje to ppp ro ssta ta?”\r\nLekár sa na neho pozrie a hovorí:\r\n”Prostata je taká choroba, keď niekto tak močí, ako vy hovoríte.”              ', 223, 2.5, 32),
	(7067, 'V ordinácii:\r\n”Pane, vy budete potrebovať veľmi silné okuliare.”\r\n”Ako ste to tak rýchlo spoznali bez vyšetrenia?”\r\n”To viete, profesionalita. A to som len gynekológ.”              ', 200, 3, 32),
	(7068, 'U kožného:\r\n”Pán doktor, jeden môj známy má podozrenie na pohlavnú chorobu.”\r\n”Čo už s vami? Tak si stiahnite nohavice a ukážte mi toho známeho.”               ', 180, 3.8, 32),
	(7069, 'Počas operácie sa pýta jeden z lekárov:\r\n”Dokedy budeme ešte operovať, pán profesor? Veď z toho pacienta už skoro nič nezostalo.”\r\n”Operovať? Tak my nepitveme? ”              ', 194, 3.86, 32),
	(7070, '“Pán doktor, mal som strašný sen. Ocitol som sa na ostrove s dvadsiatimi nádhernými mladými dievčatami... A bol som tiež dievča!”              ', 156, 3.6, 32),
	(7071, 'Príde muž k psychológovi a hovorí:\r\n- Pán doktor, stále mám dojem, že ma niekto prenasleduje. Idem po meste na bicykli a mám pocit, že je niekto za mnou. Zrýchlim, vyjdem z mesta, ale ten pocit mám stále. Tak vyjdem do kopcov, ale ten pocit neprestáva...\r\nLekár mu hovorí:\r\n- A ďalej?\r\n- Ďalej som šesťkrát vyhral Tour de France.\n', 351, 4, 32),
	(7072, 'Lekár leží na pohovke a rozpráva:\r\n- Keď ja mám výčitky svedomia, kolega. Cez deň sa to dá, hovorím si, že nie som prvý lekár, ktorý sa vyspal so svojou pacientkou. Ale v noci to je horšie. To počujem taký hlas, ktorý mi hovorí: “Karol, Karolko, veď ty si veterinár.”.              ', 308, 3.4, 32),
	(7073, 'Príde pacient k lekárovi a sťažuje sa, že pri milovaní je mu raz teplo a raz zima. Všetky vyšetrenia ukázali, že pacient je v poriadku, a tak si lekár zavolal jeho manželku. Rázna žena ho vypočula a potom sa rozčúlila:\r\n- Že ste ho nevyhodili, pán doktor! Veď on sa so mnou miluje raz v januári a druhý raz v júli.              ', 351, 3.67, 32),
	(7074, 'Rozhovor u lekára:\r\n- Tieto kvapky si budete dávať do očí trikrát denne.\r\n- Pred jedlom alebo po jedle?              ', 123, 3.67, 32),
	(7075, 'Pán doktor,skalpel!\r\nskapem?\r\nViete, pán primár kedysi začínal ako mäsiar...              ', 96, 3.6, 32),
	(7076, 'Nočná služba v nemocnici. Službukonajúci lekár sa zhovára so\r\nslužbukonajúcou sestričkou:\r\n- Pobozkajte ma!\r\n- Ja nemôžem pán doktor!\r\n- Ale, veď ma len pobozkajte!\r\n- Ja nemôžem pán doktor!\r\n- No tak, veď nerobte drahoty a pobozkajte ma!\r\n- Ja nemôžem pán doktor! Aj tak som už cela nesvoja, keď tu ležím\r\ntakáto nahá s roztiahnutými nohami pod vami...              ', 395, 2.8, 32),
	(7077, 'Na urológii sa všetko chystá na operáciu. Lekár je prichystaný,\r\nnástroje dezinfikované, mladá blonďatá sestrička po ruke, pacient na stole...\r\n- Sestrička, upravte, prosím, polohu penisu. - vraví lekár.\r\nSestrička poslúchne, lekár sa na chvíľu zamyslí a povie:\r\n- Mhm... a teraz pacientovi, prosím.              ', 336, 4.24, 32),
	(7078, 'Príde doktor na kontrolu do blázinca. V izbe na ľavej posteli leží chlap a robí, že šoféruje. Doktor sa ho spýta, čo robí.\r\n- Veziem zájazd do Španielska.\r\nNa pravej posteli leží spolupacient a pod perinou onanuje. Doktor sa ho tiež spýta, čo robí.\r\n- Vždy, keď ide Fero do Španielska, tak mu zahýbam s jeho starou...\n', 342, 4, 32),
	(7079, 'Doktor pacientke:\r\n- A kde vás pichá?\r\n- Zatiaľ v hoteli, ale sľúbil, že kúpi byt.              ', 103, 3.11, 32),
	(7080, 'Príde babka ku gynekológovi a hovorí:\r\n“Pán doktor, ja mám nejaký čudný hnedý výtok.“\r\n“Babka, to nie je výtok, to je hrdza.“\n', 145, 3.93, 32),
	(7081, '- Mali by ste sa občas aj umývať, - hovorí lekár pacientovi.\r\n- Ale veď ja sa umývam každý deň! \r\n- V tom prípade si musíte občas aj vymeniť vodu!              ', 174, 2.75, 32),
	(7082, '- Pán doktor, - hovorí hneď na úvod známy hypochonder, - všetko ma bolí!\r\n- Tak ako vždy pán Novák? - usmeje sa doktor.\r\n- Ešte viac pán doktor, ešte viac!              ', 182, 3.31, 32),
	(7083, '- Pán doktor, chcem počuť celú pravdu, čo mi je?\r\n- Keď dokážete zniesť celú pravdu, tak vám ju teda poviem: Vôbec netuším!              ', 151, 3, 32),
	(7084, '- Máte šťastie, - hovorí kartárka mladíkovi, ktorý si od nej nechal vykladať budúcnosť, - nikdy nepoznáte, čo je to choroba.\r\n- Ajajaj, to ma teda práve veľmi neteší.\r\n- Prečo, prosím vás?\r\n- Študujem v poslednom ročníku medicínu ...\n', 257, 4.2, 32),
	(7085, '- Je pravda, pán doktor, že genialita je v skutočnosti choroba?\r\n- Je, ale vy môžete byť úplne spokojná. Ste úplne zdravá.              ', 146, 3.5, 32),
	(7086, '- Viete, aké sú najťažšie chvíle v rodine patológa?\r\n- Keď si hlava rodiny prinesie prácu domov.              ', 119, 3.33, 32),
	(7087, '- Pán doktor, nikto ma neberie vážne!!\r\n- Vy žartujete!?              ', 74, 3, 32),
	(7088, '- Pán doktor, mňa nikto neberie vážne...\r\n- Aaaale, tak teraz srandujete!              ', 91, 3.92, 32),
	(7089, '- Pán doktor, koľko mi ešte ostáva času zo života?\r\n- Desať...\r\n- Čoho "desať" pán doktor - mesiacov?\r\n- ... deväť..., osem..., sedem..., šesť..., Päť...\n', 170, 3.8, 32),
	(7090, '- Pán doktor, musím sa vám s niečím zveriť. Mám ho ako novorodenec.\r\n- To je veľmi nepravdepodobné. Vyzlečte sa.\r\n- No pozrite, skutočne: tri kilá, štyridsaťpäť centimetrov.              ', 203, 3.1, 32),
	(7091, '"Pán doktor, ten simulant z trinástky zomrel."\r\n"Tak to už fakt prehnal!"              ', 90, 4.24, 32),
	(7092, 'Príde do ordinácie duch a vraví vydesenému lekárovi:\r\n"No čo, čo? Vraveli ste, že sa mám prísť za štrnásť dní ukázať!"              ', 149, 4.2, 32),
	(7093, 'Príde pani k psychiatrovi a povie:\r\n"Predstavte si, pán doktor, že keď pred niekým poviem \'abrakadabra\', tak zmizne... Pán doktor, kde ste?"              ', 160, 3.67, 32),
	(7094, 'Zubár vŕta zub a vraví pacientovi: \r\n- Musím sa dostať na nerv. \r\nPacient odpovedá: \r\n- Tak to budete musieť vŕtať riadne hlboko, pán doktor, ja mám totiž nervy v riti!              ', 194, 3.44, 32),
	(7095, 'Rozprávajú sa na Silvestra dvaja patológovia: \r\n- Tak čo, Fero, otvoríme toho Huberta?              ', 105, 3.33, 32),
	(7096, 'Príde pacient k lekárovi a sťažuje sa, že má hnačku. Lekár mu dá lieky na upokojenie. Pacient reaguje: \r\n- Ale ja nie som nervózny, ja mám len hnačku! Za dva dni príde na kontrolu a lekár sa pýta: \r\n- Máte ešte hnačku? \r\n- Mám, no a čo?              ', 270, 4.17, 32),
	(7097, 'Chlapík ide na plavbu oceánom a sťažuje sa doktorovi, že sa obáva, že dostane morskú chorobu. Doktor mu hovori: \r\n"Len zjedzte kilo dusených paradajok, kým odídete na loď."\r\nChlapík:\r\n"A to mi pomôže ?"\r\nDoktor: \r\n"Nie, len to vyzerá veľmi pekne na vode."               ', 287, 2.67, 32),
	(7098, '"Pán doktor, občas mám pocit, že počujem okolo seba hlasy, ale nikoho nevidím."\r\n"A kedy sa vám to stáva?"\r\n"No vždy, keď telefonujem."\n', 146, 3.77, 32),
	(7099, 'Boxer sa sťažuje u lekára, že nemôže spávať. \r\n"Radšej vám nepredpíšem žiadne lieky, aby ste si na ne nezvykli. Skúste to klasickou metódou. Počítajte ovce." \r\n"Skúšal som, ale nefunguje to. Vždy, keď dôjdem k číslu 9, vyskočím na nohy a začnem poskakovať..." \n', 289, 3.8, 32),
	(7100, 'Lekár hovorí policajtovi, ktorého vyšetruje: \r\n- Povedzte prosím á!\r\n- Malé alebo veľké, pán doktor?              ', 124, 2.86, 32),
	(7101, 'Do ordinácie psychiatra sa priplazí pacient. Doktor ho víta:\r\n- Ktože to k nám ide? Jašterička? Či korytnačka? Alebo snáď zmija?\r\n- Ja nie som blázon! Iba mám strach z výšky.              ', 203, 3.72, 32),
	(7102, 'Počas vizity kričí lekár na pacienta:\r\n- Ako si to predstavujete, vy pijete pivo v posteli?\r\n- Pán doktor, veď je to ležiak.              ', 145, 3.4, 32),
	(7103, 'U lekára:\r\n- Pán doktor, mám veľkú sklerózu.\r\n- Odkedy?\r\n- Čo odkedy?              ', 90, 2.67, 32),
	(7104, 'Pride muž k doktorovi a hovorí mu:\r\n"Pán doktor v poslednom čase som nejaký nervózny". \r\n"A prečo?" \r\n"Čoooo prreeečoooo!!!!!!!!!!!"              ', 155, 3.5, 32),
	(7105, 'Oznam na dverách ambulancie:\r\n"Bonboniéry a kvety nepijem!"              ', 75, 4.08, 32),
	(7106, 'Pán doktor, v poslednom čase som trochu neistý... Alebo nie?              ', 77, 4, 32),
	(7107, 'Psychiater vyšetruje pacienta a pýta sa ho:\r\n"Čo by sa stalo, keby som vám odrezal jedno ucho?"\r\n"Nepočul by som."\r\n"A čo by sa stalo, keby som vám odrezal druhé ucho?"\r\n"Nevidel by som."\r\n"Ako to?" diví sa psychiater.\r\n"Spadli by mi okuliare."\n', 254, 4.08, 32),
	(7108, 'Príde chlap k psychiatrovi:\r\n"Tak čo vám je, pán Uhorka?"\r\n"Viete, ja mám taký problém, ja si stále myslím, že som kôň."\r\n"No, to nie je nevyliečiteľná choroba, pane. Ale je to veľmi nákladná liečba."\r\n"To nebude žiadny problém, ja už som vyhral štyri dostihy."\n', 285, 3.17, 32),
	(7109, '"Pán doktor, pán doktor, práve som zhltol ovcu."\r\n"A ako vám je?"\r\n"Zle-eee."\n', 82, 2.86, 32),
	(7110, '"Pane, ako to, že máte na jazyku toľko triesok?"\r\n"No, viete, pán doktor, keď mne sa rozliala na podlahu litrovka rumu."\n', 126, 3, 32),
	(7111, '"V kolene máte vodu, v moči piesok, v žlči kamene..."\r\n"Ešte mi povedzte, že mám v bruchu cement, a začnem stavať."\n', 125, 3.5, 32),
	(7112, '"Pán doktor je v poriadku, že sa môj syn často hrá na piesku?"\r\n"Áno, tríbi sa mu tím predstavivosť a šikovnosť."\r\n"A jeho manželka sa kvôli tomu chce rozviesť!"\n', 176, 4.2, 32),
	(7113, '"Máte v bruchu hodinky," hovorí lekár pacientovi "viete o tom?"\r\n"Viem, tie tam mám už od dvanástich rokov."\r\n"A nemáte s tým problémy?"\r\n"Len pri výmene baterky."\n', 174, 3, 32),
	(7114, '"Pán doktor, čo mám robiť, keď môj manžel hovorí každú noc zo spania?"\r\n"Dajte mu príležitosť, milá pani, aby mohol prehovoriť cez deň."\n', 153, 3.25, 32),
	(7115, 'Príde stará pani k doktorovi:\r\n"Trápia ma vetry, ale nie sú počuť a nemajú ani zápach. \r\n"Berte tieto pilulky a príďte za týždeň na kontrolu."\r\nO týždeň neskôr:\r\n"Pán doktor, nielenže prdím ako vtedy, ale naviac to po tých pilulách hrozne smrdí! \r\n"Kľud pani. Teraz sme vám vyliečili čuch, napíšem vám ešte niečo na sluch."\n', 356, 3.92, 32),
	(7116, '"Pán Novák, tie bolesti vo vašej nohe sú jednoducho vekom."\r\n"Divné. Moje druhá noha je úplne rovnako stará a nebolí."\n', 128, 3.6, 32),
	(7117, '"Myslíte, pán doktor, že mi tá ruka zrastie tak, aby som vedel hrať na klavír?"\r\n"Určite!"\r\n"To je super, ja totiž na klavír hrať neviem!"\n', 149, 3.13, 32),
	(7118, '"Ako sa cítite v nových okuliaroch?"\r\n"Výborne. Zrazu stretávam plno známych, ktorých som nevidel celé roky."\n', 117, 2.67, 32),
	(7119, 'Doktor hreší sestru:\r\n"Prečo ste mi to sakra nepovedala skôr! Ja toho pacienta dva mesiace liečim na žltačku a vy mi dnes poviete, že to je Číňan!"\n', 159, 3, 32),
	(7120, 'Starý pán je na vyšetrení u doktora:\r\n"Stolicu máte pravidelnú?"\r\n"Áno pravidelnú, každé ráno o šiestej."\r\n"A kedy sa prebúdzate?"\r\n"Tiež pravidelne, o siedmej."\n', 176, 4.1, 32),
	(7121, 'Doktor sa pýta pacienta:\r\n"Fajčíte?"\r\n"Nie."\r\n"Škoda, to vám budem musieť zakázať niečo iné."\n', 104, 4, 32),
	(7122, '"Pán doktor, čo mi je?"\r\n"Neviem, to ukáže pitva!"\n', 55, 3, 32),
	(7123, 'Keď vás nezabije fajčenie, tak vás zabijú ceny tabaku.              ', 73, 3.92, 32),
	(7124, 'Strenú sa dvaja koktaví kamaráti:\r\n"Nnnazdar Jjožo, ttak ččo, aaako ssa mmmáš?"\r\n"Aaale dddobre."\r\n"Nnno a čččo tten ttvoj lllogopppedický kkkurz?"\r\n"Aaale dddobre, pppočúvaj: Strč prst skrz krk."\r\n"Nnno tto jje úplne ssskvelé, nnie?"\r\n"Aaaale áno, kkeď oono nna ttto zzas ttak často nnepríde rreč..."\n', 324, 4.17, 32),
	(7125, 'Lekár hovorí vážne chorému pacientovi:\r\n- Vy ste mali prísť pred dvadsiatimi rokmi!\r\n- Ale ja som u vás bol.\r\n- Áno? Neverím. A čo som vám povedal?\r\n- Pozri sa mi do očí, ty zasraný simulant!               ', 221, 3.13, 32),
	(7126, 'U očného lekára:\r\n- Tak, teraz prečítajte spodný riadok, pán Mrkvička.\r\n- Vytlačili Harmanecké papierne, 5000 ks, č. obj. 1432-346-65.              ', 159, 3.86, 32),
	(7127, 'Pýta sa lekár pacienta na prehliadke:\r\n- A koľko hodín denne spíte, pán Veverička?\r\n- Asi tak 3 hodiny.\r\n- Ale to je málo!\r\n- Viete, ja spím obvykle aj v noci, pán doktor...              ', 197, 2.6, 32),
	(7128, 'V nemocnici je vizita. Lekári chodia po izbách a primár im vysvetľuje, ktorý pacient má akú diagnózu. Prídu do jednej izby a tam pacient onanuje. Lekári sa pýtajú, čo mu je. Primár vysvetľue:\r\n- Má akútny nedostatok sexu, a tak musí každé štyri hodiny onanovať.\r\nPrídu do ďalšej izby a tam sestrička prevádza pacientovi orálny sex.\r\n- A tomuto je čo? - pýtajú sa lekári. Primár odpovedá:\r\n- Ten má rovnakú diagnózu ako pacient vedľa, ale tento má lepšiu poisťovňu.\n', 507, 4.18, 32),
	(7129, 'Príde žena k lekárovi na prehliadku. Ten ju dôkladne pomeria, odváži a potom hovorí:\r\n- No, zdá sa mi, že ste trošku zakrpatená.\r\n- Prosím???\r\n- Viete, s ohľadom na vašu váhu by ste mali merať asi 3,5 metra... \n', 227, 3.67, 32),
	(7130, 'Pacient: “Nemôžem sa rozhodnúť medzi operáciou a smrťou.“\r\nLekár: “S trochou šťastia môžete mať oboje.“\n', 124, 3.67, 32),
	(7131, 'Žena je na gynekologickom vyšetrení. Doktor má natiahnutú rukavicu a vyšetruje, keď tu zrazu zazvoní telefón. Druhou voľnou rukou berie telefón, tu v rukavici nevyťahuje. Niekto chce vedieť cestu do ordinácie, tak mu vysvetľuje:\r\n“Najprv prejdete cez park, potom obídete okolo školy, potom sa dáte doprava, asi 100 metrov rovno, potom doľava.”\r\nKeď položil, pacientka hovorí:\r\n“Pán doktor, prosím vás, môžete to vysvetliť ešte raz? Hlavne tú časť okolo školy?“\n', 502, 3.63, 32),
	(7132, 'Hovorí lekár pacientovi:\r\n- Mám pre vás výbornú správu. Tá nevyliečiteľná choroba, ktorou trpíte, bude niesť vaše meno!\n', 134, 4, 32),
	(7133, 'Očný lekár po vyšetrení: “Ako ste sa sem preboha dostal?!”              ', 81, 3.83, 32),
	(7134, 'Blázon naháňa doktora so sekerou v ruke. Upachtený doktor zabehne do slepej uličky a nezostáva mu nič iné, ako sa pozerať na pribiehajúceho blázna a čakať na smrť. Blázon pribehne, pozerá sa doktorovi do očí a zrazu povie:\r\n- Tu máš sekeru a teraz ma naháňaj ty !              ', 299, 4, 32),
	(7135, 'Ohromená poslucháčka anatómie odmietla odpovedať na otázku:\r\n- Ktorá časť ľudskej anatómie sa počas vzrušenia zväčší desaťkrát v porovnaní s normálom?\r\nNeodvážila sa pozrieť ani na svojich kolegov. Nakoniec jeden z nich správne odpovedal: \r\n- Ide o očnú pupilu.\r\n- Slečna - hovorí profesor - vaše odmietnutie prezrádza tri veci. \r\nPo prvé - poslednú látku ste neštudovali, po druhé - máte oplzlé predstavy a po tretie - obávam sa, že keď sa vydáte, budete strašne sklamaná.              ', 531, 3.75, 32),
	(7136, 'Na psychiatrii:\r\n- Pán doktor, mám utkvelú predstavu, že som keks.\r\n- Taký malý okrúhly s rascou uprostred?\r\n- Áno, presne taký.\r\n- Tak to si nerobte starosti. Nie ste keks, ale kreker.              ', 208, 4, 32),
	(7137, 'Pod košatým stromom sedí opitý doktor Jajbolíto. V rukách drží zajačika a recituje mu:\r\n- Prišijem ti zajko nožičku, pobežkáš si trošičku...\r\nZajko mu hovorí:\r\n- Ale hádam ani netreba, veď už ich mám zo štyridsať!              ', 251, 3.73, 32),
	(7138, 'U lekára:\r\n- Pán Škulavec, s tými novými okuliarmi môžete presnejšie rozoznávať okolie.\r\n- Je to radosť, keď človek zase vidí známych, ktorých tak dlho nevidel. Ale hnevá ma, že stretávam príbuzných, o ktorých som si myslel, že zomreli.              ', 273, 3.67, 32),
	(7139, 'Príde chlapík k lekárovi a vraví, že je asi homosexuál.\r\n- A je ešte niekto vo vašej rodine homosexuál? - pýta sa lekár.\r\n- Áno, môj brat aj môj otec. A dedko bol tiež homosexuál.\r\n- Preboha! A je v tej vašej rodine aspoň niekto na ženy?\r\n- Ale áno, moja sestra.              ', 296, 4.11, 32),
	(7140, 'Príde riaditeľ k lekárovi celý vydesený a ukáže mu celé modré prirodzenie. Lekár si ho prezerá a vraví:\r\n- To je v poriadku, len povedzte sekretárke, nech sa utiera normálnym papierom a nie kopirákom.              ', 229, 4.18, 32),
	(7141, 'Gynekológ je na súde kvôli ťažkému ublíženiu na zdraví a vypovedá:\r\n- Viete, ja som mal na stredisku štyridsať pacientiek, potom som išiel do nemocnice a mal som ďalších dvadsať pacientiek. Potom som išiel na dievčenské učilište na pravidelnú ročnú prehliadku, tých bolo dvadsaťpäť. Potom som mal ešte tridsaťpäť pacientiek na svojej privátnej praxi a keď som šiel večer unavený domov cez park, oslovila ma poškodená a povedala, že za kilo mi ju ukáže.              ', 509, 3.69, 32),
	(7142, 'Lekár vbehne do nemocničnej izby a začne triasť spiacim pacientom. Muž, ktorý leží vedľa sa ho pýta:\r\n- Prečo budíte toho pacienta?\r\n- On ešte nebral prášky na spanie! - odpovedá lekár.              ', 216, 3.67, 32),
	(7143, 'Príde do ordinácie anjel a vraví vydesenému lekárovi:\r\n"No čo? Hovorili ste predsa, že sa mám prísť za štrnásť dní ukázať!"              ', 153, 3.5, 32),
	(7144, 'Pacient: "Pán doktor, vzrušuje ma tečúca voda z kohútika. Je to nejaká úchylka?"\r\nLekár: "Iste. Ste evidentne chlorofyl."              ', 143, 3, 32),
	(7145, 'Pacient: "Pán doktor, mám prirodzenie dlhé 3 cm, môžete sa k tomu vyjadriť ?"\r\nLekár: "Bohužiaľ nie, mám opar, nemôžem sa smiať."              ', 156, 3.99, 32),
	(7146, 'U zubára\r\n"Ľúbi ma, neľúbi ma, ľúbi ma, neľúbi ma..."\r\n"Doktor! Čo mi to robíte zo zubami???"\n', 105, 3.84, 32),
	(7147, 'Do ordinácie príde Kabeš a hovorí lekárovi:\r\n- Pán doktor, je mi strašne zle, nevládzem, trasiem sa...\r\n- A okenu nepijete?\r\n- Pijem, ale nepomáha...              ', 172, 4, 32),
	(7148, 'Lekár vošiel do čakárne, posadil sa k žene a takým tým dôstojným hlbokým hlasom jej vraví:\r\n- Váš manžel je na prahu smrti.\r\nA žena sa pýta:\r\n- A môžete ho dostať cez?!              ', 201, 3.91, 32),
	(7149, 'Príde pacientka k lekárovi a vraví:\r\n- Pán doktor, mám strašne studené stehná.\r\n- A nejako vám to prekáža?\r\n- Mne nie, ale manžel mal už trikrát zápal stredného ucha.              ', 196, 3.25, 32),
	(7150, 'Lekár sa pýta slepého:\r\n"Čo ste posledné videli, keď ste prišli o zrak?"\r\n"Manželku a vidličku."              ', 119, 3.85, 32),
	(7151, 'Príde pacient k lekárovi a ten ho vyzve, aby sa vyzliekol. Pacient sa vyzlečie, lekár si ho obzerá a neveriacky sa pýta:\r\n"Prosím vás, prečo máte plechové slipy?" \r\nPacient odpovedá:\r\n"Pán doktor, aby som sa chránil pred aids."\r\nLekár prezerá pacienta ďalej a po chvíli sa opäť pýta:\r\n"A prečo, prosím vás, nemáte prsty na nohách ?"\r\n"No, pretože mi nedávno praskla guma na slipoch."              ', 425, 4, 32),
	(7152, 'Gynekológ prijíma v pondelok novú sestričku. Okrem bežných otázok sa jej zrazu opýta:\r\n”Koľko ste mala sexuálnych partnerov?”\r\nSestrička sa zamyslí a vraví:\r\n”Päť alebo šesť.”\r\n”No, to nie je nič moc.” vraví lekár.\r\n”Máte pravdu, bol to taký nudný víkend.”              ', 310, 4.22, 32),
	(7153, 'U gynekológa.\r\n”Teda milostivá, čo ste to vyvádzali, veď ste zvnútra sama trieska?”\r\n”No to viete, pán doktor, keď ten môj manžel je strašné drevo.”              ', 182, 4.06, 32),
	(7154, '”Človeče, vy ste úplne hluchý, viete o tom?” vraví lekár pacientovi. Pacient sa na neho chvíľu pozerá a potom hovorí:\r\n”Pán doktor, prestaňte nervózne prežúvať a pokojne mi povedzte, čo mi je.”              ', 232, 3.88, 32),
	(7155, 'Príde žena k lekárovi s tým, že jej manžel strašne chrápe a pýta sa, či by sa\r\ns tým nedalo niečo urobiť. Lekár vraví, že by mohol manžela operovať, ale bolo by to veľmi drahé.\r\n”Stálo by to 1000 $ na ruku, a potom počas dvoch rokov 450 $ každý mesiac, plus poplatky za poistné a za špeciálnu  starostlivosť.” vraví lekár.\r\n”Bože môj, veď to vyzerá ako leasing nového auta!” vykríkne žena.\r\n”Hmm,” zamrmle si lekár sám pre seba, ” do kelu, príliš nápadné...”              ', 531, 4, 32),
	(7156, 'Pacient sa pýta lekára:\r\n”Pán doktor, prosím vás, sú pečené haringy zdravé?”\r\n”Myslím, že áno. Aspoň sa nepamätám, že by bol niektorý z nich prišiel ku mne do ordinácie... ”              ', 214, 3, 32),
	(7157, 'Chlapík u doktora:\r\n- Pán doktor, dajte mi nejaké lieky, všetko ma bolí.\r\n- Dobre, tu máte sadu čípkov a keď ich miniete, tak sa mi príďte ukázať.\r\nChlapík príde domov, čípky pokrája a zje. O tri dni je späť.\r\n- Pán doktor, tie vaše čípky mi vôbec nepomohli.\r\n- Akože nie, no dobre, tak tu máte ďalšiu sadu.\r\nA dá mu väčšie čípky. Chlapík použije znovu ten istý postup. O týždeň:\r\n- Pán doktor, čo mi to dávate za humbuk, veď mi to vôbec nepomáha.\r\n- A čo, vy tie čípky žeriete, či čo?!\r\n- No, nie! Strkám si ich do zadku!              ', 590, 4, 32),
	(7158, 'Jeden manželský pár nemože mať deti. Kolega im poradil, aby išli ku špecialistovi do Ameriky. Idú, prídu ku špecialistovi. Nevedia nič po anglicky, tak im špecialista naznačí, aby to robili, že on sa na to pozrie. Pozerá sa asi 30 sekúnd, obráti sa, načmára niečo na recept a zavolá ďalšieho. Chlapík letí domov a hneď uteká do najbližšej lekárne.\r\n- Máte Tritheotrhol?\r\n- Čože? - pýta sa lekárnik.\r\n- Tritheotrhol! Potrebujem to kvôli deťom.\r\n- Čože? To som nikdy nepočul, máte blbý recept.\r\n- Nie! Je od amerického špecialistu. - podá lekárnikovi recept.\r\nLekárnik číta: “Try the other hole!”               ', 663, 3.89, 32),
	(7159, 'Išiel poľovník po lese, keď sa potkol o konár a strelil si brokovnicou rovno medzi nohy. V nemocnici ho dali ako tak dokopy a po operácii lekár podáva pacientovi navštívenku.\r\n- Toto je adresa môjho priateľa. Navštívte ho, iste vám pomôže.\r\n- Aj on je lekár?\r\n- Nie, on je fujarový virtuóz. Naučí vás prstoklad, aby ste sa neočúrali!', 358, 3.8, 32),
	(7160, '- Pán doktor, ja sa tak strašne bojím toho plombovania, že by som radšej rodila.\r\n- No tak si to, ale rýchlo rozmyslite, lebo práve nastavujem kreslo.', 157, 3.22, 32),
	(7161, '- Pán doktor, čo znamená to C.H.V. v kolonke diagnóza?\r\n- Čert ho vie.', 75, 3.92, 32),
	(7162, 'Chlap pride k očnému lekárovi, keď príde na rad, doktor sa ho pýta:\r\n-tak, čo vám je??\r\nChlap si stiahne nohavice i trenírky a vystrčí na doktora zadok:\r\n-pozrite sa tam!, nalieha chlap\r\nDoktor nechápe:\r\n-prepáčte, ale ak mate problém s touto partiou tela, musíte isť ku inému doktorovi....\r\nChlap stále naliehal, až sa nakoniec doktor rozhodol a pozrel sa....\r\n-No fuj to je absolútne odporné, to čo tam máte, veď je to hnus....FUJJJJ\r\na chlap povie:\r\n-no vidíte to? A toto keď si ráno odtrhujem, tak mi slzia oči.', 544, 3.81, 32),
	(7163, '-Ukážte jazyk - hovorí doktor pacientovi v ordinácii.\r\n-Ale mňa nebolí jazyk. Bolí ma žalúdok!-\r\n-Áno? Tak viete čo? Ukážte mi žalúdok!', 150, 4, 32),
	(7164, 'Prosím,ako vám môžem pomôcť?"pýta sa psychiater pacienta.\r\nPán doktor,ja vždy bývam taký nerozhodný. Alebo ani nie?"', 128, 3.86, 32),
	(7165, '"Pán doktor, ja som nervák."\r\n"Čože ste?"\r\n"NERVÁÁÁÁÁÁÁK!!!"', 71, 3.46, 32),
	(7166, 'Po prebudení z narkózy sa pýta pacient ošetrujúceho lekára:\r\n- Pán doktor, ako dopadla moja operácia?\r\n- No, všetko prebehlo v poriadku, nohu sme amputovali.\r\n- A ako to? Veď pôvodne ste mi mali operovať meniskus.\r\n- Ale veď ja viem, lenže pochopte že za amputácie sme oveľa lepšie platení.', 309, 3.29, 32),
	(7167, 'Škót u zubára sa pýta:\r\n- Trháte zuby bezbolestne?\r\n- Za príplatok vás aj uspím.\r\nPacient vytiahne peňaženku, ale zubár ho upozorňuje, že platiť bude až potom.\r\n- Ja nechcem platiť, len si pred uspaním prepočítam peniaze!', 240, 3.45, 32),
	(7168, 'Keď bol Chuck Norris malý tak padol do jamy s toxickým odpadom. Odvtedy dostala jama nezvyčajné schopnosti.', 112, 3.78, 32),
	(7169, 'Príde vlkodlak do pôrodnice a sestrička sa ho pýta:\r\n- Budete tu alebo zabalíme?', 85, 2.66, 32),
	(7170, 'Ide sanitka a v nej vodič, doktor, sestrička a študent medíciny na praxi. Idú a zrazu z ničoho nič vodič pustí volant a chytá sa kŕčovito rukami za krk. Dusí sa, oči má niekde na čele. Sestrička chytí lekárničku a buchne vodiča do hlavy. Tomu hneď záchvat prestáva, chytá opäť volant a idú ďalej.\r\nZrazu doktor padá na podlahu, chytá sa v kŕčoch za krk, váľa sa po zemi a dusí sa. Sestrička zas chytí lekárničku a buchne ho do hlavy. Doktor sa hneď postaví, sadne si a idú ďalej ako kdeby sa nič nestalo.\r\nŠtudent sa celý v šoku obracia na doktora a vraví: "Som v treťom ročníku a poznám iba teóriu, žiadnu prax, ale v živote som nepočul o takýchto symptómoch a metódy liečenia sú strašne zvláštne, som totálne zmätený. Môžete mi to aspoň trochu vysvetliť?"\r\nA doktor flegmaticky odpovie: "To nerieš, sestričke sa včera obesil manžel, a tak si znej robíme prdel..... :D', 946, 4.2, 32),
	(7171, 'Príde muž k doktorovi a sťažuje sa:\r\n"Pán doktor, pomôžte mi, rastie mi z čela ďalšie prirodzenie... Už naozaj neviem, čo mám robiť?"\r\nDoktor ho zoberie na rentgén, urobí mu vyšetrenia a potom mu vraví:\r\n"Jediné, čo Vám môžem odporúčať je - čítajte, čítajte a čítajte... a o mesiac príďte na kontrolu."\r\nO mesiac muž príde na kontrolu, stále viac nešťastný.\r\n"Pán doktor, prosím predpíšte mi nejakú inú liečbu. Všetci už na mňa pozerajú čudne. Moja žena ma nechce, deti sa mi smejú..."\r\nA doktor opäť hovorí:\r\n"Nič iné Vám nezostáva - čítajte čo najviac..."\r\nToto sa zopakuje ešte raz o mesiac.\r\nPotom príde muž znova na kontrolu a doktor mu vraví:\r\n"Skutočne, snažte sa čo najviac čítať, pretože až Vám tie gule narastú cez oči, už si nič neprečítate..."', 838, 4.03, 32),
	(7172, '- Pán doktor, celé telo ma svrbí.\r\n- A skúšali ste kúpeľ?\r\n- Skúšal. Tak týždeň-dva bolo dobre, a potom to začalo zas.', 131, 4.2, 32),
	(7173, 'Vyjde sestrička z ambulancie a kričí:\r\n"Pán Trtkal, pán Trtkal!"\r\nNikto sa neozýva. Zachvíľu vyjde zo záchoda nejaký chlapík.\r\n"Vy ste Trtkal?"\r\n"Nie, ja som sral..."', 177, 4.06, 32),
	(7174, 'Sú tri práčky. Zrazu k nim vtrhne terorista. Strelí prvú práčku,zomrie. Strelí druhú práčku,zomrie. Strelí tretiu práčku nezomrie. "Akoto, že si nezomrela..." - pýta sa. Tretia práčka skríkne "Dlhý život pre vašu práčku, váš Calgon"', 258, 4.09, 32),
	(7175, 'Pacient sa pýta doktora:\r\n- Pán doktor, je tá choroba zriedkavá?\r\nLekár odpovie:\r\n- Ani nie, cintoríny sú jej plné.', 123, 4.08, 32),
	(7176, 'Vyjde sestrička z ambulancie a kričí: "Pán Trtkal, pán Trtkal!" Nikto sa neozýva. Za chvíľu vyjde zo záchoda nejaký chlapík a sestrička sa ho pýta: "Vy ste Trtkal?" "Nie, ja som sral..."', 199, 4.11, 32),
	(7177, 'Ako pracuje gynekológ?\r\n- V týždni od siedmej do druhej, cez víkend do svojej.', 82, 3.27, 32),
	(7178, 'Doktor pri pôrode"Nakoľko vám ju zašijem?"\r\nManžel: "Tak na 12-ročné dievčatko."', 88, 3.42, 32),
	(7179, 'Vychýrený gynekológ si povedal, že už nechá svoju prácu a pôjde robiť automechanika.\r\nMusel urobť test: 50 bodov za teóriu, 50 bodov za prax. Po skúške dostal 150 bodov. Kolega sa potom pýta skúšajúceho:\r\nAko mohol dostať 150 bodov?\r\nNo, 50 za teóriu, 50 za prax a ďalších 50 za to, že to všetko dokázal cez výfuk.', 340, 4.07, 32),
	(7180, '- "Sestrička, chcem, aby ma pán doktor vyšetril," domáha sa pacient. \r- "Pane, ale tu ste v ambulancii veterinára!"\r- "Však dobre, veď mám opicu."', 154, 3.48, 32),
	(7181, 'Napis u opravára:\r\nNaše ceny so nasledovné:\r\n- Bežná oprava, $35.00\r\n- Keď sa pritom pozeráte, $40.00\r\n- Keď sa pozeráte a pritom sa pýtate, $ 50.00\r\n- Keď chcete pomôcť, $75.00\r\n- Keď si to chcete urobiť sami, $ 100.00', 234, 3.11, 33),
	(7182, 'Možný najomnik si pozerá byt, keď uvidí na strope fľak:\r\n- Čo je to tam za fľak?  - pýta sa vlastnika.\r\n- Ale, to viete... Pred vami tu býval jeden mladý chemik.\r\n- Á, tak to bude iste nejaká chemikalia.\r\n- Nie, to je ten chemik.', 242, 3.64, 33),
	(7183, 'Starší džentlmen opúšťa hotel a hovorí na recepcii: \r\n- Poslal som vám posteľ. \r\nRecepčná je z toho zmätená, ale je zvyknutá na rozmary hostí, tak odpovedá: \r\n- To ste nemuseli. Náš hotel má posteli dosť, ale aj tak vám ďakujeme, pane!\r\n- Plosím, plosím.', 278, 3.69, 33),
	(7184, 'V penzióne sa sťažuje hosť:\r\n- V izbe mám len jeden vodovodný kohútik. Prečo ste potom do prospektov uviedli \'teplá a studená voda\'? \r\n- Pretože na umývanie je tá voda studená a na pitie teplá.', 208, 3.37, 33),
	(7185, 'Lord pošle svojho syna  do mesta aby sa priučil životu. Keď sa syn ráno vráti otec mu ovonia ruku a hovorí:\r\n- Bol si u Lolity v Soho.\r\nKeď uhádne aj po tretej noci, kde si jeho syn užíval, syn si povie, že ho dobehne. Cez štvrtú noc nejde nikde a ráno si otrie ruku o zadok kobyly. Ako vždy, aj dnes lord vzal synovu ruku a ovoňal ju. Vonia, vonia... Naraz sa zvrtne a hovorí:\r\n- James, klobúk a paličku, v Londýne je nová štetka.', 454, 3.39, 33),
	(7186, 'Na americkom veľvyslanectve chlapík vypĺňa dotazník. Úradníčka sa pýta: \r\n- Sex? \r\n- Everyday!\r\n- No - no! Only: Man or Woman!\r\n- Does not matter!', 155, 3.57, 33),
	(7187, 'Viete, čo nehovorte hluchému do telefónu?\r\nDo počutia.', 58, 3.25, 33),
	(7188, '- Pred chvíľou som tu mal salámu a už je v prdeli. \r\n- Teda, ty máš ale trávenie!', 88, 3.72, 33),
	(7189, 'Jeden sa pýta škóta:\r\n- Vy u vás nemáte žobrákov?\r\n- Áno máme, ale vedia, že žobraním by sa len unavili. Aj tak od nás nič nedostanú.', 148, 3.12, 33),
	(7190, 'Správa v škótskom denníku:\r\nVčera a 12.00 sa v Glasgowe zrazili dva taxíky. 24 cestujúcich utrpelo zranenia.', 115, 3.48, 33),
	(7191, 'Sedia na streche dve dievčatá. Jedno zlé a jedno dobré, a pľujú na ľudí na ulici. Dobré dievča trafilo štyri krát, zlé iba dva krát. Čo z toho plyne? Dobro zase raz zvíťazilo nad zlom!', 201, 3.99, 33),
	(7192, 'Ako sa volá človek, ktorému chýba ľavé oko, ľavé ucho, ľavá ruka a ľavá noha? All right.', 100, 3.71, 33),
	(7193, '- Peniaze alebo život - zakričí lupič na chodca.\r\n- No, len si dajte pozor! Ovládam judo, karate, kung-fu...\r\n- Nič som nepovedal - zľakol sa lupič a vzal nohy na plecia.\r\n- ...a ešte niekoľko japonských slov.', 220, 3.38, 33),
	(7194, 'Zlodej sa na Štedrý deň dostal do väzenia. Bol z toho celý namäkko:\r\n- Ach, či som ja len nešťastný. Každý je doma pri rodinke alebo v kostole. Bože, to by sa kradlo!', 179, 3.3, 33),
	(7195, 'Názvy slipov pre mužov:\r\n35-45 - búda pre psa\r\n45-55 - skríša pre mäkkýša\r\n55-a viac - taška pre šaška', 113, 3.52, 33),
	(7196, 'Čo znamená, keď visí na podniku čierna zástava?\r\nMajú voľné miesto.\r\nČo znamená, keď visia na podniku dve čierne zástavy?\r\nMajú dve voľné miesta.\r\nČo znamená, ak visia tri zástavy?\r\nPodnik je v nútenej správe.  ', 233, 3.14, 33),
	(7197, 'Ide debil po lese a zbadá hríbik.\r\n"Aha..hlíbik...lozpučím ho..."\r\nHríbik na to:\r\n"Nie, neubližuj mi, splním ti tri želania."\r\n"Nechcem byť debil." \r\nStane sa. \r\n"Ja sa z toho poseriem."\r\nStane sa. \r\n"Ja debil! Posral som sa!"\r\n"Aha...hlíbik...lozpučím ho..."', 272, 4.11, 33),
	(7198, 'Ide jeden Chlapík po púšti a kričí:\r\n"Vodúúú,vodúú"\r\nO chvíľu najde studňu a vykríkne:\r\n"Vodá"\r\nA zo studne sa ozve:\r\n"Kde?"', 139, 3.73, 33),
	(7199, 'Kapitán Titanicu nechá zhromaždiť všetkých pasažierov a cez megafón im oznámi:\r\n- Mám pre vás dve správy. Dobrú a zlú. Ktorú chcete skôr?\r\n- Tú zlú!\r\n- Naša nepotopiteľná loď sa za pol hodiny potopí!\r\n- Preboha, a aká môže byť tá dobrá správa?\r\n- Vyhráme 10 Oscarov!', 297, 3.67, 33),
	(7200, '- Hej, počuj, zrušili daňový úrad.\r\n- A ty to odkiaľ vieš?\r\n- Ále, prišiel mi domov taký papierik a tam bolo napísané, že posledná upomienka.', 155, 3.39, 33),
	(7201, 'Koktavý príde do autobusu a pýta si cestovný lístok:\r\n- Ppprrossíím sssi jjjjjjeeee jjjeee.... jjebem nna to, iidem pppeeši.', 132, 3.88, 33),
	(7202, 'Slepý umýva doma strúhadlo a hovorí:\r\n- Takú blbosť som ešte nečítal!', 78, 3.95, 33),
	(7203, 'Hovorí gladiátor gladiátorovi vstupujúc do arény s levmi:\r\n- Čo nás nezabije, to nás posliní!', 102, 3.04, 33),
	(7204, 'Pesimista tvrdí:\r\n- Horšie od tohto sa už nedá.\r\nOptimista povie:\r\n- Ale dá sa, dá sa...', 94, 3.56, 33),
	(7205, '- Prečo si dal výpoveď z tej továrne na výbušniny?\r\n- Boli to takí škrobi! Po poslednom výbuchu, mi strhli z výplaty čas, ktorý som strávil vo vzduchu...', 166, 3.48, 33),
	(7206, 'Bola anketa verejnej svetovej mienky. Odpovedalo sa na otázku: "Prosím vás, aký je váš názor na nedostatok jedla v iných častiach sveta?"\r\nVýsledok:\r\nV afrike nik neodpovedal, pretože nevedeli čo je "jedlo".\r\nV západnej európe zas nevedeli čo je "nedostatok".\r\nVo východnej európe nevedeli čo je to "váš názor".\r\nV argentíne, čo je to "prosím vás".\r\nA v USA nik netušil čo môže znamenať "v iných častiach sveta".', 444, 3.82, 33),
	(7207, '- Mama, prdni!\r\n- Prečo?\r\n- Len tak pre orientáciu.', 53, 3.12, 33),
	(7208, 'Ako informuje svetová odborná archeologická tlač, americkým geológom - naftárom sa nedávno podaril veľmi zvláštny, mimoriadne nezvyčajný objav:\r\nNad obrovskými zásobami americkej ropy objavili akúsi neznámu arabskú  krajinu.', 242, 3.6, 33),
	(7209, 'Ide arab na ťave po púšti a okolo neho prefrčí cyklista. Večer sa ho arab v oáze pýta:\r\n- Nie je ti teplo, keď sa bicykluješ?\r\n- Nie, ja idem tak rýchlo, že má ochladí vzduch.\r\nRáno arab vylezie na ťavu, začne ju hnať, ťava beží a po hodine zdochnutá odpadne. Arab zlezie, kopne do nej a hovorí:\r\n- Sviňa jedna, určite zmrzla!!!', 353, 3.46, 33),
	(7210, 'Dámu stredného veku - takže v najlepších rokoch, zrazí auto. Jej situácia je kritická. A tu sa jej zjaví Pán Boh a vraví: \r\n- Maruška, nič sa neboj, to prežiješ, budeš žiť ešte 60 rokov!\r\nA skutočne, Maruška sa z toho dostane. Ale keď má pred sebou ešte tých 60 rokov, tak sa rozhodne, že s tým predsa musí niečo urobiť. A tak navštívi kozmetických, plastických chirurgov, natiahnu jej kožu, spravia liposukciu... Jednoducho - je z nej kus! A zasa ide po ulici, zrazu pískajú brzdy, prejde ju auto - a koniec. Ocitne sa pred Pánom Bohom a hovorí: \r\n- Pane Bože, veď si mi sľuboval ešte 60 rokov!\r\n- Ježiš, to si ty, Maruška? Ja som ťa nespoznal!', 692, 3.15, 33),
	(7211, 'Výstava avantgardného umenia. Jeden z obrazov je vlastne iba holý rám a pri ňom nálepka: "Kravy na paši"\r\n- A kde je vlastne tá paša? - pýta sa jeden z návštevníkov autora\r\n- Zožrali ju kravy\r\n- Aha, a kde sú potom kravy?\r\n- No, keď už nebolo čo pásť tak išli preč, nie?', 292, 3.29, 33),
	(7212, 'ÚVAHA O SYRE:\r\nEmentál je syr, ktorý má diery. Čím viac je syra, tým je viac dier. Čím je viac dier, tým je menej syra. Teda: čím je viac syra, tým je menej syra.', 175, 3.56, 33),
	(7213, '- Počul si o tom? Ževraj utiekol vrah z väznice!\r\n- No jasné, veď po celom meste je vyvesené "Hľadá sa Nemo".', 117, 3.3, 33),
	(7214, 'V stedoveku na galére príde dozorca k veslárom a hovorí: \r\n"Mám pre vás dve správy. Dobrú a zlú. Najprv tú dobrú. Na obed bude kurča na víne."\r\nVeslári sa radujú.\r\n"No a teraz tú zlú. Kapitán sa chce poobede povoziť na vodných lyžiach."', 257, 3.41, 33),
	(7215, 'Rozhovor na Rakúskom cisárskom dvore.\r\nSisi:\r\n- Franc, budeme mať dieťa!\r\nFranc sa prekvapene a zarazene pýta:\r\n- Si-si, si-si istá?', 138, 3.32, 33),
	(7216, 'Križiacke výpravy preslávili dve veci:\r\nPás cudnosti a zámočnícke remeslo.', 81, 2.97, 33),
	(7217, 'Aký je rozdiel medzi čiernym, brutálnym a absurdným vtipom?\r\nČierny vtip je, keď nájdeš desať bezdomovcov v jednom kontajneri.\r\nBrutálny vtip je, keď nájdeš jedného bezdomovca v desiatich kontajneroch.\r\nA absurdný je, keď nájdeš desať kontajnerov v jednom bezdomovcovi.', 288, 3.62, 33),
	(7218, 'Na ďalekej Orave.\r\n- Ujo Jano, ako sa volá vaša krava?\r\n- Neviem Miško, ale mi ju voláme Rysuľa.', 102, 1.93, 33),
	(7219, 'Žena kričí na manžela:\r\n- Prečo si vyhodil to sito?! Veď bolo celkom nové!\r\n- Aké nové ?! Veď bolo sama diera.', 120, 3.23, 33),
	(7220, 'Ak sa potíš pri polievke - si zdravý.\r\nAk sa potíš pri acylpyríne - si chorý.\r\nAk sa potíš pri sexe - si starý.\r\nAk sa potíš pri práci - si blbý.', 159, 3.42, 33),
	(7221, 'Na divokom západe sa zrazu v saloone rozletia dvere, dovnútra vojde spotený a celý zakrvavený kovboj:\r\n- Jednu Whiskey.\r\nBarman mu naleje a kovboj horlivo rozpráva:\r\n- To bol záťah, to bol záťah, červenokožci, červenokožci, všetko sme vystrieľali...\r\nHodí do seba celú Whiskey a bez slova odíde. O chvíľu sa znova rozletia dvere na saloone a vojde ďalší krvavý a spotený kovboj. Tiež si objedná Whiskey a hovorí:\r\n- To bol záťah, to bola strielačka, indiáni špinavý, všetko sme vystrieľali, ženy, deti...\r\nObráti do seba celú Whiskey a odíde. O chvíľu sa zasa rozletie dvere a k baru príde krvavý kovboj, sadne si a z vrecka vytiahne asi 30 cm kovboja, ten si objedná tiež Whiskey a hovorí:\r\n- To bola bitka, indiáni padali jeden po druhom, ženy, deti... Len s tým šamanom som si nemal začínať.', 849, 3.89, 33),
	(7222, '- Morava musí makať na čechov. Vieš prečo? Pretože česi sa váľajú pri vode.', 85, 3.04, 33),
	(7223, 'Ďalšia zahraničná pomoc pre čechov zo Slovenska:\r\nPosielame 10 000 CD Joža Ráža \'VODA, ČO MA DRŽÍ NAD VODOU\'', 119, 3.14, 33),
	(7224, 'Turisti sa blížia k najväčšiemu vodopádu na svete: \r\n- Ooo god, it\'s wonderfuuuuul... \r\n- Ooo mein Gott, das is wuuuuunderbar... \r\n- Gospoooodin, éto priekrásnoooojeee... \r\n- Doboha, to je kurevsky dobrééé...', 219, 3.36, 33),
	(7225, 'Vbehne letuška do kabíny lietadla a hovorí: \r\n- Strašný chaos, pán kapitán, všetci pasažieri sú únoscovia a každý chce letieť niekam inam.', 152, 3.21, 33),
	(7226, 'Spisovateľ poslal kritikovi dielo s názvom \'Prečo ešte žijem\'.\r\nKritik mu odpísal \'Lebo si neprišiel osobne\'.', 116, 3.56, 33),
	(7227, 'Príde kostra k radiátoru a vrúcne hovorí:\r\n- Ahoj, teta Jolana!', 67, 3.06, 33),
	(7228, 'Názov pre liek proti AIDS?\r\nNEONDIT', 36, 3.42, 33),
	(7229, 'Zaklope turista na dvere domu. Otvorí mu babka:\r\n- Čo si praješ, synak?\r\n- Dobrý, babka. Nemáte trocha pitnej vody? Mám taky hlad, že by som tu prespal.', 159, 3.71, 33),
	(7230, '"Vážení cestujúci, hovorí k Vám kapitán. Nachádzate sa na palube najväčšieho lietadla na svete. V zadnej časti je stredný plavecký bazén, bowling a tenisové kurty. Na prvej palube dostihová dráha, kino a sauny. V tomto superlietadle práve sedí päť tisíc ľudí!....a teraz sa pripútajte a držte mi palce. Pokúsim sa to hovädo rozbehnúť!"', 366, 3.42, 33),
	(7231, '- Pán doktor, mám taký problém. Vždy, keď poviem abrakadabraka, niekto zmizne. Pán doktor, kde ste?', 106, 3.16, 33),
	(7232, 'Rozprávajú sa dvaja hluchonemý pri kávičke:\r\n........................................?\r\n.................................!', 127, 3.7, 33),
	(7233, 'Viete, ako zabijete pásomnicu? \r\nNajprv vypijete mlieko a potom zjete čokoládu. Opakujete to tri dni a na ďalšie ráno vypijete iba mlieko. Potom z vás výjde pásomnica a povie:\r\n- A čokoláda je kde?!\r\nA vtedy ju vytiahnete.', 233, 3.4, 33),
	(7234, 'Pýta sa kamarát kamaráta:\r\n- Čo to žuješ?\r\n- Sekundové lepidlo!\r\n- Ako? Nerozumel som, čo to žuješ?\r\n- Hmmm!', 118, 3.37, 33),
	(7235, 'Viete kedy má ovečka najviac vlny? \r\nKeď je na nej baran.', 60, 3.2, 33),
	(7236, 'Viete, čo je najväčšia šikovnosť?\r\nKeď pošteklíte žiarovku a v elektrárni sa zasmejú.', 97, 2.97, 33),
	(7237, 'Je to čierne a má to jednu nohu, čo je to?\r\nJednonohý černoch.\n\r\nJe to čierne a má to dve nohy, čo je to?\r\nDvojnohý černoch.\n\r\nJe to čierne a má to tri nohy, čo je to?\r\nKlavír.', 190, 3.34, 33),
	(7238, 'Rozpráva sa japonský a ruský magnetofón.\r\nRusky sa pýta: \r\n"Ako sa maš?"\r\nJaponský na to: \r\n"Dobre. Pán mi kúpil novú kazetu!"\r\nRusky na to: \r\n"Heeej? Daj aj mne požuť!"', 181, 3.55, 33),
	(7239, 'Ide škúľavý ku škuľavému a hovorí:\r\n"Čo sa mi škeríš."', 66, 3.26, 33),
	(7240, '"Prosím Vás, koľko je hodín?"\r\n"Desať desať."\r\n"Ďakujem, ďakujem."', 74, 3.29, 33),
	(7241, 'Stoja dvaja kozmonauti na Mesiaci pred raketou a nevedia sa dostať dnu. Prvý sa otočí k druhému a vraví:\r\n- Nekukaj tak na mňa, ja som nezamykal.', 152, 3.35, 33),
	(7242, 'Príde chlapík do pekla a Satan ho sprevádza komnatami, aby si vybral trest, ktorý bude robiť 200 rokov. Príde teda do prvej miestnosti a tam bičujú do krvi obete. Chlapík zhnusene hovorí:\r\n- Nie, tak toto teda nechcem.\r\nIdú do druhej a tam mučia ohňom. To sa mu tiež nepozdáva a tak prídu do tretej miestnosti.  Tam vidí nádhernú blondínu ktorá uspokojuje starého dedka. A chlapík celý naradostený hovorí: \r\n- Áno, toto chcem.\r\nSatan podíde k blondíne a hovorí: \r\n- Choď, si voľná.', 514, 3.54, 33),
	(7243, 'Vyjde Žofré na palubu svojej lode a hovorí galejníkom:\r\n- Mám pre vás dobrú a zlú správu. Tá dobrá je, že každý dostane pečené kura a liter vína. Tá zlá je, že keď to dojete a dopijete, Angelika si chce zajazdiť na vodných lyžiach.', 255, 3.39, 33),
	(7244, 'Viete čo je to prd?\r\nZúfalý pokus prírody naučiť zadok spievať.', 70, 4.04, 33),
	(7245, 'Príde kostra do mäsiarne a prezerá si ponuku dňa. Predavačka sa jej pýta:\r\n- Čo si prosíte?\r\nA kostra jej odpovedá:\r\n- Pozerám, čo teraz letí.', 154, 2.74, 33),
	(7246, 'Je to čierne a je to medzi nohami. Čo je to?\r\nČernoch pod stolom.', 68, 3.09, 33),
	(7247, 'Aký je rozdiel medzi mozgom a rozumom? \r\nMozog má každý, ale rozum málokto.', 80, 3.1, 33),
	(7248, 'Zomrel Einstein, Newton... Ale aj mne je akosi blbo. ', 53, 3.24, 33),
	(7249, 'Čo je to bobkový list?\r\nBobky obalené v liste.', 49, 2.91, 33),
	(7250, 'Na vrchu je to zelené a vo vnútri červené. Čo je to?\r\nPokazená saláma.  ', 79, 3.06, 33),
	(7251, 'Stretne holohlavý hrbatého a pýta sa ho:\r\n- Počuj kolega, čo to máš na chrbte?\r\n- Harmoniku, ty hovädo strapaté!', 121, 3.03, 33),
	(7252, 'Ide muž po džungli a stretne tlupu domorodcov. A povie si:\r\n- Tak teraz som v riti.\r\nVtom sa z neba ozve hlas:\r\n- Zober ten kameň vedľa teba a hoď ho do náčelníka!\r\nMuž neváha, zoberie kameň, hodí do náčelníka a zabije ho. A z neba sa ozve:\r\n- Tak teraz si už fakt v riti!', 288, 3.41, 33),
	(7253, 'Hovorí banán vybrátoru:\r\n"Čo sa trasieš, veď teba nezjedia!"', 66, 3.53, 33),
	(7254, '"Gejza koľko?"\r\n"Dvesto."\r\n"A čo dvesto?"\r\n"A čo koľko?"', 60, 3.37, 33),
	(7255, 'Keď ťa život omrzel ,\r\nkeď ti už nič nejde,\r\nsadni si na dialnicu, \r\nono ťa to prejde.', 93, 3.59, 33),
	(7256, '- Juro, čo si dostal na narodeniny?\r\n- Vidíš to červené ferrari na parkovisku?\r\n- To si fakt dostal to auto?\r\n- Ale prd. Takej istej farby som dostal rukavice.', 164, 3.63, 33),
	(7257, 'Měl černý kabát, černý brýle, bílou hůli a černýho psa. Tvářil se, že mne nevidel. Tak sem ho sejmul, frajera.', 124, 3.49, 33),
	(7258, 'Panenstvo je choroba, ktorá sa dá liečiť.', 45, 3.07, 33),
	(7259, 'Syn zistí, že má 3 vajcia. Príde za dedom a hovorí mu: \r\n"Dedo, spolu máme 5 vajec."\r\nA dedo: \r\n"Čože, ty máš iba jedno?"', 131, 3.6, 33),
	(7260, 'Letí holub a zrazu pod sebou vidí ísť slepca.\r\nVraví si:\r\n"Vyseriem sa na neho, aj tak ma neuvidí.\r\nSpustí na neho hovno no slepec sa rýchlo uhol.\r\n"To nie je možné", vraví si holub a tak zavolal ďalšieho holuba. \r\nSkúšajú to obaja, ale slepec sa znova úspešne vyhol. Zavolajú celý kŕdeľ a skúšajú trafiť slepca, ale ten sa opäť uspešne vyhne bombardovaniu.\r\nČo z toho vyplýva?\r\nŽe slepý hovno vidí.', 433, 3.43, 33),
	(7261, 'Za 20 vrchnákov z vodkových fliaš,\r\nperfektnú opicu na týždeň máš.\r\nKeby si len 15 fľašiek mal,\r\naj tak by si sa dobre uťal.\r\nVodka, Brendy, Pepsi.\r\nZaručená opica záchytku vyber si.', 197, 3.04, 33),
	(7262, 'Dvoj metrová potvora,\r\nvkročila nám do dvora.\r\nA teraz už nevkročí.\r\nMá motyku v obočí.', 96, 4.14, 33),
	(7263, 'Príde Jano k Ďurovi a pýta sa ho.\r\n- Počuj Ďuro, máš doma bicykel?\r\n- Hej mám. Prečo?\r\n- Ale, moja sestra sa chce pozrieť aké i sa píše po b.', 154, 3.14, 33),
	(7264, 'Príde žaba ku doktorovi s ponožkou na hlave doktor sa pýta:\r\n- Čo sa vám stalo?\r\n- Nežartuj, toto je prepad.', 115, 3.6, 33),
	(7265, 'Triedenie žien podľa Jilemnického diel:\r\n- 15 rokov: "Pole neorané"\r\n- 20 rokov: "Kus cukru"\r\n- 30 rokov: "Kronika"', 119, 3.18, 33),
	(7266, 'Lev naháňa tri opice. Ušli mu na strom, tak sa rozhodol, že počká. Prvá nevydržala po troch dňoch, zišla dolu, lev ju zožral, takto sa to opakovalo aj s ďalšími dvomi, v krátkych intervaloch. A aké plynie z toho ponaučenie?\r\nKaždá sa raz spustí,len treba počkať.', 284, 3.2, 33),
	(7267, 'Koktavý sa vysmieva plešatému:\r\n"Popopopočúvaj. Kokokokoľko tytyty miminieš zazaza hrebebebeňe."\r\n"Určite menej ako ty za telefón."', 141, 4.03, 33),
	(7268, 'Pesničky na želanie - volá záhorák:\r\n- Zahrajte, prosím vás, to oné od Metaliky.', 88, 3.07, 33),
	(7269, 'Existujú tri typy ľudí. \r\nĽudia, čo vedia rátať a ľudia, čo nevedia.  ', 79, 3.58, 33),
	(7270, 'V lietadle sa otvoria dvere pilotnej kabíny a do lietadla vstúpi kapitán. Vezme padák a hovorí:\r\n- Mám pre vás dve správy. Jednu dobrú a druhú zlú. Najprv tá zlá. Nemáme palivo a o chvíľu začneme padať. Tá dobrá, idem po pomoc.', 247, 3.31, 33),
	(7271, 'V reštaurácii na východnom Slovensku:\r\n- Pani, vy ste perla.\r\n- Ja nepérla, to stolička vérzla.', 101, 3.56, 33),
	(7272, 'Ide pacient k doktorovi a hovorí. \r\n- Pán doktor, mám sklerózu. \r\n- Odkedy? \r\n- Čo odkedy?', 95, 3.1, 33),
	(7273, 'Maliar sa pýta pastiera:\r\n- Môžem namalovať vaše ovce?\r\n- Radšej nech ostanú biele.', 90, 3.05, 33),
	(7274, 'Keď budeš do mňa vnikať prstami, rob to pomaly a jemne. Predtým si ich poriadne nasliň, aby si celou silou precítil obrovský príval energie. \r\nTvoja elektrická zásuvka.', 179, 3.74, 33),
	(7275, 'Viete čo je rýchlejšie ako svetlo?\r\nSomálec s poukážkou na potraviny.', 75, 3.44, 33),
	(7276, 'Rýchly Jack miluje Mary. Zrazu ktosi zaklope na dvere. Mary skríkne:\r\n- Rýchlo bež, to bude môj manžel!\r\nJack v momente skočí von oknom, Mary si chvatne cez seba hodí župan a ide ku dverám. Otvorí a tam Jack:\r\n- Zabudol som si nohavice...', 250, 3.08, 33),
	(7277, '"Do prdele zlomila sa mi lopata!"\r\n"Tak sa opri o rýľ!"', 57, 3.44, 33),
	(7278, 'Novodobé porekadlo:\r\nNeodkladaj na zajtra to, čo môžeš odložiť navždy.', 78, 3.61, 33),
	(7279, 'Ide tučná pani po ulici a spieva si:\r\n- Keby som bola jahodou...\r\nA okoloidúci pán dospieva:\r\n- To by bolo džemu!', 118, 3.49, 33),
	(7280, 'Štátny hygienik SR vyhlasuje, že do odvolania vtáčej chrípky musia všetky sliepky ostať doma a spať len s vlastným kohútom.', 134, 3.02, 33),
	(7281, 'Beží uprostred noci klaun za riaditeľom cirkusu\r\n- Pán riaditeľ! Horí nám šapitó!\r\n- A čo? Hltač ohňa býva vo vedľajšej maringotke.', 146, 3.11, 33),
	(7282, 'Na jednej vidieckej krčme sa objavil napis: \r\n"Nedávajte sa okrádať inde. Prídte k nám!" ', 95, 3.18, 33),
	(7283, 'Tá dnešná mládež je ako zajace. Zaujíma ich iba tráva a sex.', 67, 3.66, 33),
	(7284, 'Stojí Čukča na kraji Čukotky a cez Beringovu úžinu kričí smerom na Aljašku:\r\n- Chudáci zasrani, bedári všivaví, holota americká...\r\nNejaký Američan mu kričí naspäť:\r\n- Prečo by sme mali byť chudáci?\r\n- Aljašku ste kúpili a na Čukotku vám peniaze nestačili? Chudáci zasraní.', 303, 3.62, 33),
	(7285, 'Rozprávajú sa traja lenivci:\r\n- Chlapi, horí nám dom.\r\n- Veď nás vynesú.\r\n- Že sa vám o tom chce hovoriť.', 115, 3.33, 33),
	(7286, '- Obžalovaný, tvrdíte, že ste hodily po poškodenej paradajky?\r\n- Áno.\r\n- Ako si vysvetľujete tú hrču na hlave?\r\n- Paradajky boli v konzerve.', 149, 3.42, 33),
	(7287, '- Jožo, páči sa mi tvoj naslúchači aparát. Čo stál?\r\n- Je pól dvanástej.', 82, 2.96, 33),
	(7288, 'Aký film majú najradšej anorektičky?\r\nGrci-grci-grcičky.', 61, 3.05, 33),
	(7289, 'Telegram\r\nDedko dostal telegram: Máte potomka - blahoželáme k prvému vnúčaťu!\r\nDedko sa chytí za hlavu a hovorí: Ani nenapíšu, čo to je, či chlapec alebo dievča a tak neviem či som babka alebo dedko ?!', 216, 3.61, 33),
	(7290, 'Syn pračloveka donesie vysvedčenie zo školy. Otec ho číta a hovorí:\r\n- To, že máš 3 z lovu je pochopiteľné, veď si ešte malý. Ale, že si prepadol z dejepisu, ktorý má len dve strany, to je hanba.', 212, 3.3, 33),
	(7291, 'Winnetou a Old Shatterhand idú po lese a objavia jaskyňu. Winnetou hovorí:\r\n- Ja idem dovnútra preskúmať jaskyňu a môj biely brat ma zatiaľ počká vonku, keby sa niečo stalo.\r\nOld Shatterhand súhlasí, tak Winnetou vojde do jaskyne. Zrazu sa ozve veľká rana, výkrik a Winnetou vyjde z jaskyne s modrým okom. Old Shatterhand bez váhania vbehne do jaskyne, aby zistil, čo sa tam stalo. Tiež sa ozve veľká rana, výkrik a aj on vyjde von s modrým opuchnutým okom. A Winnetou sa ho pýta:\r\n- Čo, aj môj biely brat stúpil na hrable?', 553, 3.48, 33),
	(7292, 'List Santa Clausovi:\r\nMilý Santa, na vianoce by som si hrozne želal sestričku.\r\nOdpoveď prišla obratom:\r\nOk, pošli mamičku. ', 131, 3.32, 33),
	(7293, 'Letuška sa pýta cestujúceho:\r\n- Prosíte si niečo jesť?\r\n- A z čoho si môžem vybrať?\r\n- Áno alebo nie.', 112, 3.6, 33),
	(7294, 'Čo je absolútna smelosť?\r\nZobrať si naraz preháňadlo a prášok na spanie.', 80, 3.57, 33),
	(7295, '- Zuzka, Zuzka, máš naopak gaťky!\r\n- Čože, kvietkami dozadu?\r\n- Nie, osratým von!', 87, 3.8, 33),
	(7296, 'Pristaví sa ufo na benzínku, vystúpi ufón, príde k čerpadlu a hovorí:\r\n"Ahoj, ja som ufón a ty??"\r\nČerpadlo ticho. Ufón zase:\r\n"Ahoj ja som ufón a ty??"\r\nČerpadlo ticho. Ufón už nazlostený tretí krát:\r\n"Ahoj ja som ufón a ty??"\r\nČerpdlo ticho. Ufón hovorí:\r\n"Si myslíš, že si frajer keď máš chuja v uchu??"', 333, 2.84, 33),
	(7297, 'Kloktaním najrýchlejšie zistíme, či nám neprestrelili krk...', 66, 2.45, 33),
	(7298, '- Koľko je hodín?\r\n- Štyri.\r\n- A všetky?', 44, 2.72, 33),
	(7299, 'Veľké dopravné lietadlo Boeing 747 Jumbo Jet je už plné ľudí. Všetci sa uvelebujú vo svojich kreslách. Pri zadných dverách sa zrazu spustí nejaký povyk. Uličkou medzi cestujúcimi kráča do pilotnej kabíny prvý pilot. Má na očiach čierne slepecké okuliare a bielou paličkou si oťukáva cestu. Za ním druhý pilot, taktiež v slepeckých okuliaroch a s paličkou. Cestujúci sa na to pozerajú ako vo sne. Niekto prehodí: \r\n- To bude vari nejaký fór... \r\nBrrrrZZZZZZzzzzzzZZZZZ... \r\nNabiehajú motory a lietadlo sa dáva do pohybu. Cestujúci sú už skutočne nervózni, noria sa do kresiel a ani nedýchajú. Lietadlo zrýchľuje, už by malo byť vo vzduchu, ale nie je. Blíži sa koniec štartovacej dráhy. Ktosi to už nevydržal a začal jačať. Po sekunde jačí strachom celé lietadlo. V tom momente sa lietadlo zdvihne a odlepí od zeme. Slabšie nátury už vracajú... A v pilotnej kabíne hovorí prvý pilot druhému: \r\n- Kolega, mám také obavy, že jedného dňa tí vzadu nezačnú včas jačať a všetci sa tu pozabíjame.', 1072, 3.65, 33),
	(7300, 'Je veľká tlačenica v električke. Pani, snažiaca sa zachrániť pred pádom pri brzdení električky, zachytí sa omylom údu vedľa stojaceho pána.\r\n- Prepáčte, nechcela som.\r\n- Pani, či chcela, či nie, ja som šachysta a tam platí, že kto už chytil figúrku, musí s ňou dohrať!', 294, 3.33, 33),
	(7301, 'Heslo GREENPEACE:\r\nZabi bobra - zachrániš strom.', 50, 3.19, 33),
	(7302, 'Sedia dvaja žobráci v metre. Jeden má na tabuľke napísané PRISPEJTE ÚBOHÉMU ŽIDOVI  a ten druhý PRISPEJTE ÚBOHÉMU ŽOBRÁKOVI. Prvý nemal v klobúku ani mincu ale druhý ich tam mal kopu. Ide okolo babka, pristaví sa pri nich, prečíta si nápisy a vraví:\r\n- Prečo si, synak, namiesto žid nenapíšeš žobrák? Aj ty by si niečo zarobil.\r\nNato sa žid otočí na kolegu a hovorí mu:\r\n- Nechápem, Izák, ako nás niekto môže poučovať o obchode.', 469, 3.49, 33),
	(7303, 'Je tma. Zrazu počujem vŕzganie a tiché kroky. Zapnem svetlo a naskytol sa mi nezvyčajný pohľad... Dvere skrine boli dokorán a babkin kabát potichu vychádzal z módy.', 174, 3.33, 33),
	(7304, 'Dvaja sedia v Saloone na Divokom západe a jeden hovorí:\r\n"Vidíš tam toho v tom klobúku?"\r\n"Ktorého, všetci majú klobúky?"\r\n"Veď ten čo má kolty za opaskom."\r\n"Všetci majú kolty za opaskom."\r\n"Ale ten čo má kožené čižmy."\r\n"Všetci majú kožené čižmy."\r\nPrvý sa nahnevá a okrem jedného všetkých postrieľa.\r\n"No vidíš toho čo zostal?"\r\n"jasneee."\r\n"Strašne ho neznášam."', 404, 3.35, 33),
	(7305, 'Z ulice počuť hlas\r\n- Máte niečo na shudnutie?\r\n- Samozrejme, ale prečo nevojdete dovnútra? - pýta sa lekárnik.\r\n- Nemôžem.', 133, 3.69, 33),
	(7306, '- Dedo pomoc! - volá na radu 10 ročný vnuk.\r\n- Starkej sa pošmykol rebrík a spadla do hnoja!\r\n- A to musíš tak vrieskať? Nevieš dať rebrík na miesto aj sám?!', 169, 3.41, 33),
	(7307, 'V jednom čiernočiernom lese, na jednej čiernočiernej čistinke, sedia pri čiernočiernom ohni dvaja čiernočierni chlapíci a jeden hovorí tomu druhému.\r\n- Počuj, nemali by sme prestať s tým pálením pneumatík?', 223, 3.31, 33),
	(7308, 'Reklama:\r\nV kórejskom zajateckom tábore vyrábajú väzni obuv pre nepriateľskú armádu. Zrazu sa jeden postaví a začne búchať po pracovnom stole:\r\n- My chceme jedlo, my chceme jedlo. \r\nPridajú sa k nemu aj ostatní väzni. Hlukom privolaný strážca vystreli dávku do vzduchu a do vzniknutého tichá autoritatívne prehlási so šikmáckym prízvukom, prstom ukazujúc na nedokončené výrobky: \r\n- Just do it!', 424, 2.98, 33),
	(7309, 'V jednom dome býva flegmatik s cholerikom. V jeden deň sa cholerik kúpe vo vani, keď tu zrazu flegmatik otvorí dvere do kúpeľne, príde k vani, naberie lyžičku vody z vane a odíde. Cholerik sa na flegmatika  nepekne pozrie, ale udrží si ešte nervy na uzde. Za minútu flegmatik zasa príde do kúpeľne, naberie za lyžičku vody a  keď už odchádza, tak cholerik mu nahnevane hovorí:\r\n- Čo ti šibe? Čo tu beháš ak splašený?\r\nFlegmatik sa na neho pozrie, pekne sa usmeje a odíde. O minútu opäť flegmatik príde do kúpeľne, naberá lyžičku vody, keď cholerik už celý nasratý na neho skríkne:\r\n- Ty asi chceš dostať na hubu!!! Čo sa robí?\r\nFlegmatik sa otočí smerom k nemu a hovorí:\r\n- Kľud, horíme.', 742, 3.66, 33),
	(7310, 'Hosť vraví čašníkovi: \r\n- Pán hlavný, prosím vás, nedalo by sa dopiecť to kurča? \r\n- Vám sa zdá nedopečené? \r\n- Čo ja viem, len mi z taniera vyzobáva zemiaky...', 177, 3.45, 33),
	(7311, 'Príde dedko do bordelu, že si užije, ale bordel mama mu hovorí:\r\n- Dedko, vy už to máte dávno za sebou.\r\nDedko:\r\n- Áno? A čo som dlžný?', 146, 3.13, 33),
	(7312, 'Oznam: Zajtrajší čaj o 4-tej bude o 5-tej.', 45, 2.98, 33),
	(7313, 'V plnom lietatdle Boing 757 sedí 200 ľudí, ktorí čakajú už len na pilotov. Hlavná letuška nahlási, že piloti sú už na ceste. O malú chvíľu vojdu do lietadla dvaja slepí páni s čiernymi okuliarmi a pomaly si razia svojimi paličkami cestu ku pilotnej kabíne. Ľudia sa divia a po krátkej chvíli si uvedomia, že toto sú ich piloti. Piloti sa usadia do kabíny. Lietadlo naštartuje turbíny a a o tri minúty sa už rúti obrovskou rýchlosťou po štartovacej dráhe. V tom si jeden z cestujúcich uvedomí, že štartovacia dráha sa už končí, čo oznámi aj ostatným cestujúcim. V lietadle sa strhne panika a krik. Na to sa ale lietadlo zodvihne zo zeme a stúpa do výšin. V tom povie jeden pilot druhému.\r\n- Ty Fero, ja mám taký pocit, že tí ľudia v lietadle raz nezačnú včas kričať a všetci sa tu pozabíjame.  ', 857, 3.47, 33),
	(7314, 'Dôjde žena do hračkárstva a hovorí predavačovi:\r\n- Viete, ja mám takú múdru, inteligentnú a šikovnú dcéru. Preto by som jej chcela kúpiť nejaké puzzle, skladačky, alebo niečo podobne.\r\nPredavač odíde dozadu a donesie jej 500 puzzle. Žena však vraví:\r\n- Veď som Vám hovorila že je to múdre dieťa, toto je pre ňu nič.\r\nPredavač znova odíde dozadu a donesie jej 1000 puzzle. Žena však znova nie je spokojná.\r\n- Ona je veľmi inteligentne dieťa, nemáte tam niečo ťažšie?\r\nPredavač donesie zozadu 2000 puzzle no žena je znova nespokojná. Predavač to už nevydrží a hovorí:\r\n- Pani, tak viete čo? Chodte oproti do potravín, tam kúpte strúhanku, a nech Vám to Vaše inteligentne dieťa poskladá rohlík.', 750, 3.65, 33),
	(7315, 'Babka ide po cintoríne a zrazu vidí chlapíka ako vykopáva hroby vyberá\r\nmŕtvoly a vynáša ich pred bránu cintorína. Babka zhrozená pribehne k\r\ndotyčnému chlapíkovi:\r\n"Čo to preboha živého robíte!?"\r\nChlapík na ňu kukne a vraví:\r\n"Aaaaale volali mi že tu mám bombu tak evakuujem."', 301, 3.38, 33),
	(7316, 'Prosím vás nemáte něco k pití?Ja sem tak hladný,že nemám s kým spát.', 78, 2.96, 33),
	(7317, 'Stretnú sa traja mŕtvy v nebi a rozprávajú sa o tom, kto ako zomrel. Prvý hovorí:\r\n- Ja som prišiel domov a žena nahá. Prehľadal som celý byt. Vyzrel som z balkóna a čo nevidím, nejaký DEBO sa prstami drží z vonku balkónového zábradlia. Tak som mu po tých prstoch búchal, až spadol. Pozrel som sa, ale on sa ešte hýbal. Tak som na neho hodil chladničku, ale zachytil som sa o ňu a spadol som na zem. Neprežil som.\r\nDruhý hovorí:\r\n- Tak, ja som opravoval strechu, keď som sa zrazu pošmykol. Našťastie som sa zachytil balkónového zábradlia na štvrtom poschodí. Zrazu prišiel nejaký BLÁZON ktorý mi začal búchať po prstoch. Tak som spadol. Išiel som sa zdvihnúť, ale on na mňa hodil ešte chladničku. Neprežil som.\r\nTretí hovorí:\r\n- Ja neviem ako to bolo, ale ja som sa schoval do chladničky a niekto ma vyhodil von.', 868, 3.58, 33),
	(7318, 'Oči a zadok sú navzájom prepojené.\r\nStrčíš prst do zadku a pučia sa ti oči.\r\nStrčíš prst do oka a hneď sa poserieš. ', 130, 3.78, 33),
	(7319, 'Príde Vojto do kupé vo vlaku a pri ňom sú piati inžinieri. Po chvíli sa inžinier ozve a povie číslo 6 a každý sa začne smiať. Po hodine sa Vojto spýta: \r\n- Prečo, keď niekto povie číslo, tak sa každý začne smiať?\r\nInžinier mu odpovedá.\r\n- Nechce sa nám hovoriť, tak sme si očíslovali každý vtip a už nemusíme hovoriť celý vtip ale stačí nám povedať číslo a budeme vedieť o aký vtip ide.\r\nTak to skúsi Vojto. Povie číslo 3, ale nikto sa nesmeje. Vojto sa čuduje a spýta sa:\r\n- Prečo sa nikto nesmeje?\r\nA druhý inžinier mu povie.\r\n- Lebo vy to neviete tak podať.', 611, 3.12, 33),
	(7320, 'Sedia v krčme japonec, američan, angličan, francúz a slovák. Japonec pľuvne na američana a ten mu hovorí: \r\n- To si posral, ideme von! \r\nZvonku je počuť bum, prásk, tresk, vráti sa japonec a vraví: \r\n- To bolo karate. Od nás. \r\nJaponec pľuvne na angličana a ten vraví: \r\n- To si posral, ideme von ! \r\nZvonku počuť bum, rach, tresk, vráti sa japonec: \r\n- To bolo kendo. Tiež od nás. \r\nPotom zapľuje na francúza a idú von. Zvonku zasa počuť: bum, bác, prásk, vráti sa japonec a hovorí: \r\n- To bolo džudo. Tiež od nás. \r\nKeď zapľuje na slováka, ten hovorí: \r\n- To si posral, ideme von. \r\nZvonku počuť jedine tresk! Vráti sa slovák a hovorí: \r\n- To bol hever z Mazdy. Tiež od nich. ', 722, 4.29, 33),
	(7321, 'Čo má spoločné manželka a športka?\r\nCelý týždeň len sľubuje a sľubuje a nakoniec dá v nedeľu niekomu inému.', 122, 3.26, 33),
	(7322, 'Na divokom západe utiekol zo zoologickej záhrady slon. Kovboj Bill telefonuje šerifovi:\r\n- Šerif! Pomoc! V mojej záhrade je obrovský sivý potkan a chvostom trhá kapustu.\r\n- A čo s ňou robí?\r\n- Šerif! Neuveríš! Pchá si ju do riti.', 244, 3.54, 33),
	(7323, 'Príde Santa Klaus do Somálska a pýta sa detí:\r\n"Detičky prečo máte také veľké brušká?"\r\n"Lebo nepapáme!"\r\n"No, kto nepapá ten nič nedostane."', 156, 3.41, 33),
	(7324, 'Viete, prečo už nedávajú Filmárika a Filmušku?\r\nLebo sa zadusili v koberci. ', 82, 2.99, 33),
	(7325, 'Na premiére novej divadelnej hry sa ozve hlas z balkóna:\r\n- Zhasnite svetlá na javisku! Chcem si pospať.\r\n- V žiadnom prípade, oponuje hlas z prvého radu. Ja chcem dočítať noviny.', 189, 3.73, 33),
	(7326, 'Viete, aký je rozdiel medzi špenátom a soplíkom?\r\nŠpenát deťom nechutí!', 79, 4.15, 33),
	(7327, 'Človek bez viery, je ako ryba bez bicykla.', 43, 3.12, 33),
	(7328, 'Texaský milionár sa ubytuje v luxusnom londýnskom hoteli. Mrzí ho, že si ho nikto nevšíma, preto sa rozhodne zavolať na čašníka:\r\n- Pán hlavný, prosím si za sto dolárov hemendegs!\r\n- Ľutujem,- odpovedá slušne časník - ale polovičné porcie u nás nepodávame.', 280, 2.96, 33),
	(7329, 'Príde kovboj do baru a zastrelí všetkých pritomných okrem jednej krásnej baby. Potom k nej príde a vraví :\r\n"Slečna a čo vy tu tak sama ?"', 148, 3.18, 33),
	(7330, 'Čurám, čurám proti vetru,\r\nčože to mám na tom svetru,\r\na či daždík, a či rosa,\r\nale čoby, ošťal som sa !', 118, 3.31, 33),
	(7331, 'Aký je rozdiel medzi somálčanom a pomarančom?\r\nNo predsa 20 gramov.', 71, 3.05, 33),
	(7332, 'Jde takhle debil po lese a najednou před sebou spatří obrovského hřiba, napřahuje nohu a říká:\r\n"Jé, hele, houba."\r\nNajednou hřib zvedne klobouk a sděluje milému debilovi, že je dědeček hříbeček a že mu splní tři přání. A debil říká:\r\n"He, já už nechci být debil."\r\n"He, já už nejsem debil, já se z toho podělám."\r\n"Jé, ja se podělal, sem já to ale debil."\r\n"Jé, hele, houba."', 416, 2.86, 33),
	(7333, 'Vedomostná súťaž - finále:\r\nModerátor: - Povedzte nám rozdiel medzi...\r\nSúťažiaci: - Medzi čím?\r\nModerátor: - To vám nesmiem prezradiť.', 150, 2.95, 33),
	(7334, 'Veštkyňa veští žene budúcnosť a hovorí jej:\r\n- V krátkej budúcnosti príde váš manžel o život.\r\nŽena sa preľaknuto spýta: \r\n- A neprídu mi na to?', 163, 3.13, 33),
	(7335, 'Príprava volského oka:\r\nHodia sa vajcia na rozpálenú panvicu a oči už vylezú samé !', 91, 3.77, 33),
	(7336, 'Hovorí sused susedovi:\r\n- Pán sused, počuli ste už, že v Košiciach sa začne variť nové pivo?\r\n- Nevravte, a aké?\r\n- Insbrucký ležiak!', 145, 2.97, 33),
	(7337, 'Príde žena do obchodu a pýta sa.\r\n- Do you speak English?\r\n- Yes.\r\n- No takže si môžeme začať.', 102, 2.81, 33),
	(7338, 'Buch, buch, buch.\r\n- Otvorte, tu je ŠTB!\r\n- My nemôžeme, tlačíme letáky.', 78, 3.26, 33),
	(7339, 'Klop, klop.\r\n"Kto tam?"\r\n"Svedkovia Jehovovi. Chceme sa porozprávať."\r\n"A koľkí ste?"\r\n"Dvaja."\r\n"Tak sa porozprávajte."', 125, 3.49, 33),
	(7340, '- Pane, vy ste sviňa.\r\n- Kroch?', 32, 3.48, 33),
	(7341, 'Rozprávajú sa dvaja :\r\n- Kúpil som si úplne novú knihu.\r\n- Áno? A ako sa volá?\r\n- Epos o Gilgamešovi!  ', 111, 2.81, 33),
	(7342, 'V malej dedinke hučí miestny amplión:\r\n- Dobrý deň, tu starosta. Našli sa dva kľúče. Jeden FABkový a druhý takýto.', 126, 3.27, 33),
	(7343, 'Veľká povodeň na Morave. Ďuro a Jano sedia na strome a pozerajú na vodu pod nimi. V tom k nim po hladine pripláva klobúk, otočí sa a ide naspäť. Keď to takto pokračuje už desiaty krát, vraví Ďuro Janovi:\r\n- Počuj, nezdá sa ti to čudné, že ten klobúk pláva stále hore a dole? \r\n- A ty si včera v krčme Fera nepočul, keď vravel "povodeň, nopovoden, orať sa musí"?', 393, 3.37, 33),
	(7344, 'Učiteľka sa pýta detí:\r\n- Detičky, kam pôjdete tento rok na dovolenku?\r\nPrihlási sa Janko a hovorí:\r\n- No, my doma všetci vieme po nemecky, tak asi pôjdeme do Nemecka.\r\nPrihlási sa Anička a vraví:\r\n- My doma rozprávame po anglicky, tak asi pôjdeme do Anglicka.\r\n- A ty, Móricko, kam pôjdete? - pýta sa učiteľka.\r\n- No, my doma škaredo rozprávame, tak asi pôjdeme do prdele.', 396, 3.06, 33),
	(7345, 'Jednému chlapíkovi kradli decká v noci melóny. Raz sa nahneval a na pole dal tabuľku s nápisom:  "Jeden melón je napustený kyanidom." \r\nRáno nechýbal ani jeden melón, ale na tabuli bolo detskou rukou pripísané: \r\n"Teraz sú tie melóny dva!"', 254, 3.46, 33),
	(7346, 'Príde trpaslík na čerpaciu stanicu a vraví pumpárovi:\r\n"Prosím si dve kvapky benzínu a jednu kvapku oleja."\r\nPumpár sa naňho pozrie: \r\n"A prdnúť do pneumatiky by si nechcel?"', 185, 3.57, 33),
	(7347, 'Janko a Marienka sa prechádzali po lese a zbadali mláku. Janko sa zohol a chcel sa napiť, avšak v tom mu Marienka hovorí:\r\n- Janko nepi, narastú ti rohy.\r\nA Janko na to:\r\n- No a čo, imidž je nanič, nasleduj inštinkt!', 226, 3.17, 33),
	(7348, 'Na hodine matematiky: \r\n- Zajtra sa píše písomka. Absencie neuznávam. Ani úmrtie v rodine, ani svadby, nič!\r\n- A čo sexuálna vyčerpanosť?\r\n- Neuznáva sa, budeš písať ľavou rukou!', 193, 3.51, 33),
	(7349, 'Hovorí jeden bacil druhému:\r\n- Človeče, dnes vyzeráš hrozne!\r\n- Ále, asi som chytil penicilín.', 102, 3.13, 33),
	(7350, 'Príde chalan na diskotéke za hanblivou slečnou a hovorí jej: \r\n- Prosím ťa, nejdeš si zatancovať? \r\n- Hmm, no, tak idem. \r\n- Tak fajn, nemám si totiž kde sadnúť.', 173, 3.91, 33),
	(7351, 'Heslo tohto dňa:\r\n- Mám pocit, že takto pred týždňom bol už piatok.', 74, 2.91, 33),
	(7352, 'Pán Boh si zavolal Clintona, Jeľcina a Billa Gatesa a povedal im, že za tri dni bude koniec sveta, aby to oznámili na Zemi.\r\nJeľcin prišiel domov, zvolal si svoju Dumu a povedal im:\r\n" Mám pre vás dve zlé správy. Boh naozaj existuje a tá druhá je, že o tri dni bude koniec sveta."\r\nClinton si zvolal kongres a povedal:\r\n"Mám pre vás jednu dobrú a jednu zlú správu. Tá dobrá je, že Boh naozaj existuje a tá zlá je, že o tri dni bude koniec sveta."\r\nBill Gates si zvolal svojich programátorov a povedal im:\r\n"Páni, mám pre vás dve dobré správy. Tá prvá je, že patrím medzi troch najdôležitejších ľudí planéty a tá druhá je, že do ďalšieho vývoja Windows nemusíme už vraziť ani dolár!"', 733, 3.3, 33),
	(7353, 'Pýta sa koktavý holohlavého:\r\n"ko-ko-ko-koľko mi-mi-minieš z-zz-za ho-ho-ho-holiča?"\r\n"Určite menej ako ty za telefón."', 127, 3.15, 33),
	(7354, 'Bača Ondro príde za bačom Ďurom a vraví:\r\n"Bača Ďuro, požičajú mi varechu na syr."\r\nBača Ďuro sa zamyslí a vraví si:\r\n"Požičiam mu varechu na syr, nevráti mi ju, nedorobím syra, zle bude. Nepožičiam mu varechu, nasere sa, zatne mi valaškou medzi oči, tiež bude zle. Ej dám mu ja len takú vyhýbavú odpoveď."\r\n"Počúvajú bača Ondro, a hybajú mi do riti."', 384, 3.29, 33),
	(7355, 'Sedí chlápek v hospodě a pojídá polívku. Najednou se rozčílí a zavolá\r\nsi vrchního:\r\n"Pane vrchní, teda to si říkáte jednička? To je normalní Bordel! V tý vaší polívce se mi utopil pavouk!"          \r\nVrchní se omluví, někam odejde a za chvíli se vrací. V ruce drží pavouka.\r\n"Tady máte jinýho, ale sakra chlape, hlídejte si ho!"', 360, 3.27, 33),
	(7356, 'Bola vyhlásená súťaž o najlepší toaletný papier. Každý mal obhájiť svoj výrobok. Prišli Američania:\r\n"Náš papier je superjemný, supervoňavý, superfajnový, v rôznych farbách...".\r\nKomisia vyskúšala, Američania sa umiestnili na treťom mieste. Prišli Rusi:\r\n"Náš papier je nielen voňavý, farebný a jemný, ale aj mierne vlhký, takže vám zadok aj poumýva."\r\nRusi skončili na druhom mieste. Jednoznačne však zvíťazili Japonci. Tí prišli s tabletkou. Komisii vysvetlili:\r\n"S touto tabletkou už nepotrebujete žiaden toaletný papier. Zhltnete ju pred jedlom a na záchode h...o vyjde už zabalené v celofáne."', 650, 3.18, 33),
	(7357, 'Príde chlapík do saloonu, kde okrem barmana sedí pri bare chlap so ženou a rozprávajú sa. Chlapík vytiahne kolt, muža pri bare zastrelí, pokojne si prisadne k žene a hovorí:\r\n- Dobrý večer, slečna, a čo tu robíte tak sama?', 238, 3.01, 33),
	(7358, 'Idú dvaja dole vo výťahu a jeden sa pýta: \r\n"Počúvaj, toto je rýchlovýťah?" \r\n"Nie, to sme sa odtrhli."', 112, 3.08, 33),
	(7359, 'Dvaja černosi oblečení len v bedernom páse, s kosťou vo vlasoch, sedia pred slamenou chatrčou a ohlodávajú zvyšky ľudských kostí. Vtom sa jeden z nich otočí k druhému a hovorí:\r\n- Tohle je jinačí žrádlo než v Praze v Mense, žejo, pane inženýre?', 268, 3.28, 33),
	(7360, 'Stoja dvaja kozmonauti na Mesiaci pred raketou a jeden hovorí druhému: \r\n"Nepozeraj na mňa tak sprosto, ja som nezamykal."', 125, 3.19, 33),
	(7361, '-- Poopravené príslovie --\r\nKto sa smeje naposledy, o chvíľu umrie.', 71, 3.01, 33),
	(7362, 'V lietadle sa rozprávajú dvaja páni:\r\n- Viete, vždy keď letím lietadlom, tak sa stane niečo zlé! \r\nZrazu príde letuška a hovorí: \r\n- Milí cestujúci, lietadlo padá do mora, ale nebojte sa, každý z Vás dostane píšťalu a tou odoženiete žralokov!\r\nA ten pán: \r\n- No, nehovoril som? A buď dostanem zlú píšťalku, alebo natrafím na hluchého žraloka!', 373, 3.31, 33),
	(7363, 'Redaktor sa pýta Britney Spears:\r\n- Poznáte Hamleta?\r\n- Napíšte len, že sme dobrí priatelia.', 98, 2.96, 33),
	(7364, 'Pride hosť do hotela a ubytuje sa. Vojde do izby a vidí veľkú ceduľu\r\ns nápisom:\r\n"Vážený hosť, nedivte sa ak večer vylezú krysy. Za chvíľu prilezú hady a zožerú ich."', 184, 3.2, 33),
	(7365, 'Vyčerpaná žena ide po púšti. Chytí ju kmeň domorodcov. Náčelník sa jej spytuje:\r\n"Smrť, alebo hongo bongo?"\r\n"Hongo bongo."\r\nOdpovedá žena. Vštetci sa na nej vyšantia. Žene sa podarí ujsť, ale  kmeň ju dohoní a náčelník sa pýta:\r\n"Smrť, alebo hongo bongo?"\r\n"Smrť!"\r\nOdpovedá žena.\r\n"Dobre, ale najprv trošku honga bonga."', 351, 3.14, 33),
	(7366, 'Hovorí lysý beznohému:\r\n"Dupni na to fáro, nech mi veje háro!"', 67, 2.98, 33),
	(7367, 'Čo je to maximálna staroba?\r\nKeď sa pohladkáš po hlave a vypadnú ti vlasy.', 80, 2.91, 33),
	(7368, 'Chlapček vidí gang motorkárov a chce sa k ním ihneď pridať. \r\n- Zoberieme ťa, synku, len keď dokážeš, že si drsňák.\r\n- To teda som!\r\n- Dokáž to.\r\n- Dnes som si zadok utieral žihľavou namiesto toaletného papiera.\r\n- To je nič. Príď, keď budeš drsňák.\r\nDruhý deň:\r\n- Tak čo, už si drsňák?\r\n- Hej, dnes som si zadok utieral šmirgľovým papierom.\r\n- To je nič. Príď, keď budeš drsňák.\r\nTretí deň:\r\n- Tak čo, už si drsňák?\r\n- Hej, dnes som si zadok utieral sadou žiletiek.\r\n- Smola mladý, ty nie si drsňák. Drsňák si zadok neutiera!', 580, 3.95, 33),
	(7369, 'Príde muž k oprav8rovi TV a vraví:\r\n- Pozerám futbal, klincom si špáram v uchu, zrazu puk a vypol sa zvuk.', 112, 2.97, 33),
	(7370, 'Mamička hovorí synčekovi:\r\n- Synček, nemal by si toľko chodiť na tie zábavy, lebo ohluchneš!\r\n- Díky mami, už som obedoval.', 133, 2.92, 33),
	(7371, 'Bavia sa dvaja pri pivku.\r\n- Tak ti prídem predčasne zo služobky, vrazím do bytu, otvorím skriňu - nič. Pozriem pod posteľ - nič. Otvorím chladničku - nič.\r\n- A čo na to manželka? - pýta sa druhý.\r\n- Aká manželka? Ja som slobodný. Ale vykradli mi byt!', 270, 3.26, 33),
	(7372, '- Pozri, starý, tá strakatá sliepka je nejaká smutná. Nemala by som z nej uvariť polievku?\r\n- No... ak myslíš, že ju to rozveselí.', 140, 3.17, 33),
	(7373, 'Do kupé vojde muž a slečny, ktorá tam sedí sa opýta:\r\n"Smiem si prisadnúť?"\r\nOna odpovedá:\r\n"Samozrejme, veď sú vaše!"', 130, 3.17, 33),
	(7374, 'Do cely odsúdeného na smrť vojde dozorca a vraví.\r\n- Počúvaj, teba sa budú zajtra pred popravou pýtať na posledné prianie, že?\r\n- No a čo má byť?\r\n- Pozri, kámo,- pokračuje dozorca,- ty už vlastne nič nepotrebuješ...tak požiadaj, aby mi zvýšili plat!', 272, 3.15, 33),
	(7375, 'Jánošíka vedú na šibenicu. Keď sú skoro na mieste, vytrhne sa drábom a zvolá:\r\n- Ľudia, za čo?\r\nA ľudia:\r\n- Za rebro!', 129, 3.17, 33),
	(7376, 'Porekadlo bezdomovca.\r\nVšade dobre, na stanici najlepšie.', 59, 3.03, 33),
	(7377, 'Hovorí otec synovi:\r\n"Synu ti ši taky glupy jak toto drevo", a poklope na stôl. \r\nSyn na to: \r\n"Ocec dachto klope."', 118, 3.58, 33),
	(7378, 'Dobrá rada pre mužov:\r\n"Každý večer pohár mliečka, bude ti stáť ako sviečka."', 87, 4.09, 33),
	(7379, 'Chvíľka úprimnosti:\r\nKedysi... kedysi som bol naozaj pyšný. Ale teraz... teraz som už úplne dokonalý. ', 110, 3.36, 33),
	(7380, 'Chlapík sedí v obývačke a pozerá televízor. Zrazu niekto zazvoní pri dverách. Otvorí ich a vo dverách stojí smrťka s veľkou kosou opretou cez plece. Chlapík zbledne, začne sa triasť a prosí:\r\n- Ešte nie, prosím, ešte nie! Veď je toľko vecí, čo by som chcel ešte stihnúť! \r\nSmrťka sa na neho pozrie a s úsmevom mu hovorí:\r\n- Ja idem len po škrečka! ', 380, 3.88, 33),
	(7381, 'Príde James Bond do baru a v rohu sedí sama krásna žena.\r\nPodíde k nej a šarmantne sa predstaví:\r\n"My name is Bond. James Bond."\r\nKráska zdvihne zrak a odpovie:\r\n"Off. Fuck Off."', 186, 2.96, 33),
	(7382, 'Haló, je tam škola tanca a slušného chovania?\r\nAle hovno, iba slušného chovania.', 86, 3.14, 33),
	(7383, 'Viete aký je rozdiel medzi záchodom a knižnicou? \r\nV knižnici sú diela naších predkov a v záchode diela našich zadkov.', 127, 3.14, 33),
	(7384, 'Viete, ako spoznáte snehuliaka "buzeranta"?\r\nŽe má mrkvu v zadku.', 68, 3.43, 33),
	(7385, 'Colná kontrola, colník nájde v kufri auta akýsi sáčok s bielym práškom. Otvorí ho, namočí doňho prst, oblizne a s úsmevom sa pýta šoféra:\r\n- Herák, herák?\r\n- Nie, antrax, antrax.', 196, 3.17, 33),
	(7386, 'Nápis v eskimáckom pánskom WC: \r\n"Keď si sa vyčúral, odstav pekne cencúľ do kúta."', 91, 3.02, 33),
	(7387, 'Sedí Francouz v restauraci, pojída s klidem svou snídani.\r\nVedle nej sedí typicky Američan a žvýka žvýkačku, nespokojen že si ho\r\nFrancouz nevšíma. Začne tudiž konverzaci:\r\n"Jíte u vás celý chleba?"\r\n"Samozrejme."\r\n"My né, my sníme pouze střídku, kúrky smíchame dohromady a pak z nich\r\npečeme croisanty, které prodávame do Francie."\r\nFrancouz mlčí a nereaguje. Američan znervózní a pokračuje dále:\r\n"Jíte u vás pečivo s marmeládou?"\r\n"Samozrejme."\r\n"My né, my jíme k snídani čerstvé ovoce,a ze slupek pak lisujeme\r\nmarmeládu, kterou prodávame do Francie."\r\nFrancouz se usmeje a zeptá se ho:\r\n"A co u vás, co deláte s kondomy po jejích použití?"\r\n"Vyhodíme je, samozřejme."\r\nTo my né," reaguje Francouz a pokračuje: "my jeshromaždíme, recyklujeme a pak z nich vyrábíme žvýkačky, které prodávame do Ameriky."', 870, 3.58, 33),
	(7388, 'Hovorí Detvanec v krčme:\r\n- Chlapi, tí Česi sú vám voľajaký čudný národ. Toť minule som bol v tej ich Prahe v hoteli a z ničoho nič mi vpadne jeden Čech o pol druhej v noci do izby a začne mi brýzgať. Zachoval som však kľud a ďalej som preberal na fujare.', 276, 3.1, 33),
	(7389, 'Posledné slová Supermana.\r\n"Ktorá sviňa mi natrela lano vazelínou"', 71, 2.62, 33),
	(7390, 'V jednom dome žijú spolu cholerik a flegmatik. Raz večer sa cholerik kúpe a zrazu k nemu pribehne flegmatik s polievkovou lyžicou, naberie trochu vody a s kľudom odíde. Takto to urobí tri razy. Na štvrtý krát sa ho naštvaný cholerik pýta:\r\n- Čo to dočerta stváraš?\r\n- Len kľud, horí dom.', 307, 2.87, 33),
	(7391, 'Stroskotá loď na malom ostrovčeku. Zachráni sa žena a dvaja muži. Po 10 dňoch žena hovorí:\r\n"Už mám dosť tých prasačín, zabijem sa."\r\nI tak sa stalo. Po ďalších 10 dňoch jeden z mužov hovorí:\r\n"Už mám dosť tých prasačín, zakopme ju."\r\nI tak sa stalo. Po ďalších 10 dňoch druhý muž hovorí:\r\n"Už mám dosť tých prasačín, vykopme ju !"', 371, 3.39, 33),
	(7392, 'Keby kúpele Smrdáky konečne zrušili to "S"!\r\nTo by boli kúpele!', 68, 3.05, 33),
	(7393, 'Najvážnejšie štyri prekážky, pre ktoré sa naše hospodárstvo nemôže vyhrabať z ťažkostí, podľa zistenia štatistického úradu: Jar, leto, jeseň, zima.', 167, 2.54, 33),
	(7394, 'Ide si tak chlapík po pralese a zrazu ho obstanú domorodci s kopijami, lukmi a tak. Chlapík si hovorí:\r\n"A som v keli." \r\nNaraz zahrmí, zablýska sa, otvorí sa nebo a hlas hovorí:\r\n"Nie si v keli, pri nohách máš kameň, hod ho do náčelníka!"\r\nChlapík pozrerá, pri nohach fakt leží kameň, nuž ho zdvihne a z celej sily ho hodí do náčelníka. Ten padne v krvi mrtvý na zem.\r\nOpäť sa otvorí nebo a hlas hovorí:\r\n"Tak a teraz si v keli!"', 460, 2.64, 33),
	(7395, '- Pane, nepite tú vodu, je v nej slintačka.\r\n- Co ste říkal?\r\n- Nech vám padne na úžitok.', 96, 3.59, 33),
	(7396, 'Recept, ako zaručene dostať menštruáciu:\r\n1. Chci sa dnes milovať.\r\n2. Vyhoď všetky tabletky proti bolesti.\r\n3. Obleč si nové biele nohavičky, ktoré sa perú len v ruke.\r\n4. Plánuj ísť na plaváreň so svojim novým objavom.\r\n5. Nemaj doma žiadne vložky.', 270, 2.98, 33),
	(7397, 'Pýta sa jeden vodník druhého.\r\n- Prečo stále šiješ topánočky do sucha aj do vodičky?\r\n- Pre vietnamcov na trh.', 120, 2.72, 33),
	(7398, 'Muž počuje zvonenie tak ide otvoriť dvere. Otvorí ich a vidí tam malú smrtku s veľkou kosou, hneď ho zaleje pot a začne lapať po vzduchu. Smrtka na to:\r\n"Kľud idem iba pre škrečka."', 194, 3.2, 33),
	(7399, 'Jánošík ide takto v stredu dolu dolinou a stretne Uhorčíka.\r\n- Kam ideš, Ďuri?\r\n- Ále, zájdem vari opáčiť Maru do dediny.\r\n- A načo ti je modlitebná knižka?\r\n- Nuž, keď bude dobrá, ostanem vari do nedele.', 222, 3.01, 33),
	(7400, 'Čo urobíš ak uvidíš opicu v chladničke?\r\nVyberieš predsa zrkadlo. ', 73, 2.9, 33),
	(7401, 'Idú tri spermie vedľa seba a rozprávajú sa.\r\nJedna vraví: - Ja budem dievčatko.\r\nDruhá vraví: - Ja budem chlapček.\r\nTretia im hovorí: - Netešte sa, ideme dolu krkom.', 176, 3.04, 33),
	(7402, '- Prosím vás, neviete koľko je hodín?\r\n- Viem!\r\n- Ďakujem!', 63, 3.59, 33),
	(7403, 'Za nami potopa a pred nami len spúšť...\r\nA na spúšti prst.', 63, 3.45, 33),
	(7404, 'Stretnú sa dvaja ľudožrúti a jeden drží urnu. Ten druhý sa ho pýta:\r\n"Kde si zohnal instant?"', 101, 3.19, 33),
	(7405, 'Je to farebné a nie je to vidieť, čo je to?\r\nZakopané farbičky.', 68, 2.88, 33),
	(7406, 'Pri vstupe do synagógy je napis: Nevstupuj dnu bez pokrývky hlavy! Je to ako by si scudzoložil!\r\nPod tým je rukou pripísané: Skúsil som oboje, nedá sa to ani porovnať!', 176, 3.06, 33),
	(7407, 'Ktoré mlieko je najlepšie?\r\nMaterské, lebo má sympatické balenie.', 70, 3.05, 33),
	(7408, '- Bože, aká strašná búrka bola v noci! Nespôsobila ti škody na chate?\r\n- Neviem. Ešte som ju nenašiel.', 111, 2.77, 33),
	(7409, 'Fyzik, biológ a matematik idú po ulici a vidia, že do jedného domu vošli traja muži a vzápätí vyšli štyria. Fyzik to komentuje: \r\n- Páni, to je jasná chyba merania.\r\nBiológ mu oponuje: \r\n- Nie, oni sa medzitým rozmnožili.\r\nMatematik se usmeje a povie: \r\n- Nemáte pravdu. Teraz tam vojde ešte jeden a nebude tam nikto.', 335, 3.26, 33),
	(7410, 'Neznámi muž klope na dvere a kričí:\r\n- Pustite ma dnu! Len sa vyseriem a hneď pôjdem!', 91, 2.89, 33),
	(7411, 'Čašník zbadá, ako si hosť čistí príbor obrusom, a napomína ho:\r\n- Prepáčte, ale to nerobte. Po prvé, príbor je čistý. A po druhé, pozrite sa, ako ste zašpinili obrus!', 183, 3, 33),
	(7412, 'Do plného autobusu vstúpi skinhead. Sediaca babka vstane a pustí ho sadnúť si so slovami:\r\n"Pod si sadnúť, chudáčik , taký mladý a po chemoterapii\r\na ešte aj ortopedické topánky musíš nosiť."', 208, 3.25, 33),
	(7413, 'Chcete počuť úprimne hodnotenie vašej osobnosti a presný čas?\r\nVytočte ľubovolné telefónne číslo okolo tretej hodiny ráno.', 135, 3.13, 33),
	(7414, 'Jaký je rozdíl mezi vrchním a servírkou?\r\nVrchní přiráží 5 procent, servírka ostošest.', 97, 3.33, 33),
	(7415, 'Policajt Dežovi:\r\n- Dežo priznaj sa, ty si pálil slivovicu.\r\n- Nepálil!\r\n- Ale prístroj máš.\r\n- Mám.\r\n- Tak zaplatíš pokutu 500 Sk.\r\nDežo chvíľu premýšľa a potom položí na stôl 1000 Sk.\r\n- A tých druhých 500 je za čo?\r\n- Za znásilnenie.\r\n- Dofrasa a koho si znásilnil?\r\n- No nikoho, ale prístroj mám!', 326, 2.95, 33),
	(7416, 'Viete, čo je vrchol Veľkej noci 21.storočia? \r\nKeď vám namiesto šibačov príde sms-ka: "Šibi-ribi". ', 108, 2.51, 33),
	(7417, '- Vieš povedať m?\r\n- Vien!', 28, 2.51, 33),
	(7418, '"Stará mama prečo máš také velké oči?"\r\nA stará mama odpovie s krikom:\r\n"Čo nevidíš že kadím."', 107, 3.23, 33),
	(7419, 'Príde chlapík do pekla a Satan ho sprevádza komnatami, aby si vybral trest, ktorý bude robiť 200 rokov. Príde teda do prvej miestnosti a tam obete bičujú do krvi. Chlapík zhnusene hovorí:\r\n- Nie, tak toto teda nechcem.\r\nIdú do druhej a tam mučia ohňom. To sa mu tiež nepozdáva a tak prídu do tretej miestnosti. Tam vidí nádhernú blondínu, ktorá uspokojuje starého dedka. A chlapík celý naradostený hovorí: \r\n- Áno, toto chcem.\r\nSatan podíde k blondíne a hovorí: \r\n- Choď, si voľná.', 514, 3.32, 33),
	(7420, 'Jeden pyrotechnik si z dovolenky priniesol nové tričko. Na prednú stranu si dal napísať: \r\n\'Pracujem z trhavinami\'\r\nNo a na zadnú stranu si dal nápis: \r\n\'Keď ma uvidíte utekať, snažte sa ma dobehnúť!\'', 213, 3, 33),
	(7421, 'Na kohútich zápasoch:\r\nAko zistíš, že je tam Francúz?\r\n- príde s kačicou\r\nAko zistíš, že je tam Talian?\r\n- vsadí na kačicu\r\nA ako zistíš, že je tam mafia?\r\n- kačica vyhra', 187, 3.15, 33),
	(7422, '- Vy ste sa ale vyznamenali! - vraví sudca synovi známeho politika, - ukradnúť auto! Iba čo hanbu robíte rodine.\r\n- Akú hanbu! Viete, akú mali radosť, keď to auto zbadali?', 181, 3.22, 33),
	(7423, 'Medzi ekonómami:\r\n- Vieš, koľko ľudí treba v trhovej ekonomike na zakrútenie žiarovky?\r\n- Ani jedného. Trh všetko vyrieši.', 132, 2.97, 33),
	(7424, 'Haló! Je tam jazykovedný ústav? Tu profesor Ryska. Mám otázku. Má sa správne hovoriť "lichobežník" alebo "nepárnoutekač"?', 133, 2.94, 33),
	(7425, 'Viete aký je rozdiel medzi erotikou a perverzitou?\r\nErotické je použiť pierko. Perverzné použiť celé kura.', 114, 2.77, 33),
	(7426, 'Keď máš skutočne blbý deň a vypadá to, že ťa všetci chcú naštvať, zapamätaj si, že potrebuješ 42 svalov k zamračeniu a iba 4, aby si natiahol prostredník a poslal ich do...', 190, 3.35, 33),
	(7427, 'Ide debil po lese a nájde hríbik.\r\n"Aha, hríbik!"\r\nVtom hríbik povie:\r\n"Netrhaj ma, splním ti tri priania!"\r\nA debilko povie:\r\n"Nechcem byť debil."\r\n"Bože, ja sa poseriem, veď som normalny!"\r\n"Ja debil, veď som sa posral."\r\n"Aha, hríbik!"', 248, 2.87, 33),
	(7428, 'Ide pani v paneláku a vidí ani nie desaťročného chlapca ako tam fajčí\r\nna schodoch. Pani sa ho pýta:\r\n- Ako to, že už fajčíš?\r\nChlapec na to:\r\n- Keď som sa včera miloval, tak prečo by som nefajčil?\r\nPani je z toho celá zmetená, tak se ešte opýtá: \r\n- A mal si z toho vôbec niečo?\r\n- Nemal, bol som ožratý ako prasa!', 341, 3.35, 33),
	(7429, 'Ide reportérka po meste a zrazu pred jedným domom zbadá šťastne oddychujúceho dedka. Príde k nemu a pýta sa ho : \r\n- Dedko, prezraďte ako to robíte, že vyzeráte tak dobre a spokojne? \r\n- No, každé ráno si dám pol fľašky rumu, na obed zo desať pív, vyfajčím tak päť krabičiek cigariet a večer dopijem tu fľašku rumu. \r\n- Hmm, dobre. A ak sa vás môžem opýtať, koľko máte rokov?\r\n- 27.', 417, 3.09, 33),
	(7430, 'Rozprávajú sa kritik so spisovateľom:\r\n- Čítal som vašu knižku.\r\n- Tú poslednú?\r\n- To dúfam!', 102, 3.62, 33),
	(7431, 'Dedko s babkou stoja v nebi na nádhernej pláži. Všade okolo nich sú šťastní ľudia, nikto nemá žiadne starosti - proste sú v raji. Vtom dedko vylepí obrovskú babke.\r\n- Prečo si to urobil? - pýta sa babka.\r\n- Keby nie tá tvoja sprostá diéta, už by sme tu mohli byť dva roky.', 293, 3.49, 33),
	(7432, '- Fero, ten nový práci prášok je nádherný! Tvoje tričko je teraz žiarivo biele!\r\n- Nosil som ho radšej, keď málo nápis "Chicago Bulls".', 147, 3.12, 33),
	(7433, 'V knižnici:\r\n- Prosím si niečo na čítanie.\r\n- Niečo ľahšie?\r\n- Netreba, som tu autom.', 93, 3.02, 33),
	(7434, '- Nedávno som prečítal jednu z vašich básni.\r\n- Poslednú?\r\n- Dúfam.', 74, 2.82, 33),
	(7435, 'Prichádza trpaslík do lekárne:\r\n- Prosím si aspirín!\r\n- Zabaliť?\r\n- Nie, budem si ho kotúľať.', 102, 2.83, 33),
	(7436, 'Zazvoní telefón:\r\n- Prosím.\r\n- Hej, počuj, máš clip?\r\n- Nie, nemám...\r\n- HA!!! Tak potom viem o tebe všetko, ty sviňa!', 127, 2.91, 33),
	(7437, 'Viete ako zistíme, že mŕtvola bola uškrtená kozmodiskom?\r\nPrezradí ju jej úsmev na tvári.', 97, 3.27, 33),
	(7438, 'Zamyslíme sa... Prečo kamikadze piloti nosili prilby?', 55, 3.45, 33),
	(7439, 'Pýtajú sa Fína: \r\n- Aké bolo tento rok u vás leto?\r\nFín odpovedá: \r\n- Neviem, ja som bol obidva dni opitý.', 114, 3.1, 33),
	(7440, 'Workoholik chce vedieť, čím bude po smrti. Veštkyňa sa zahľadí do kryštálovej gule a po chvíli hovorí: \r\n- Budete veľmi úspešný futbalista.\r\n- Ale ja som v živote do lopty ani nekopol.\r\n- Tak bežte trénovať, lebo v sobotu hráte prvý zápas.', 261, 3.32, 33),
	(7441, 'Heslo slovenských televíznych reality show: \r\nNie je dôležité zúčastniť sa, ale prežiť tú hanbu.', 107, 3.37, 33),
	(7442, 'Ide dedko do bordelu a vstúpi do výťahu. Vystúpi na 1.poschodí a tam stojí nápis \'blondínky\'. Ide na 2.poschodie a tam stojí \'brunetky\'. Na 3.poschodí \'červenovlásky\'. Na 5.poschodí stojí \'ázijské tanečnice\'. Tak príde až na 10.poschodie a tam stojí \'Prišiel si si užiť alebo sa voziť výťahom?\'.', 321, 3.04, 33),
	(7443, '- Človeče, predstav si, na víkend hlásili 30 stupňové horúčavy! \r\n- To nie je možné. \r\n- Ale áno. 15 stupňov v sobotu a 15 stupňov v nedeľu.', 154, 2.38, 33),
	(7444, 'Do baru príde koktavý:\r\n"P-p-p-prosím si j-j-j-jeden ko-ko-koňak!"\r\n"Ne-ne-nenech sa p-p-páči!"\r\nVojde ďalši hosť:\r\n"Urob mi jedno pivo!"\r\n"Nazdar, Franta, hneď to bude."\r\nTen koktavý hovorí čašníkovi:\r\n"N-n-nemusíte sa k-k-k-kvôli m-m-m-mne pretvarovať."\r\n"J-j-j-ja sa p-p-p-pretvarujem k-k-k-kvôli n-n-nemu."', 329, 3.35, 33),
	(7445, 'Smrťka stojí pri dverách bytu a hovorí:\r\n- Dobrý deň, odčítanie ľudu.', 78, 3.51, 33),
	(7446, 'Stojí babka na koľajách, nepočuje vlak.\r\nA teraz ma rušňovodič na okienku fľak.', 87, 3.11, 33),
	(7447, 'Dvaja muži sedia v kupé. Jeden šúpe banán, osolí ho, ochutná a nakoniec vyhodí. Znova ošúpe, posolí, ochutná a vyhodí. Druhý muž sa pýta: \r\n- Prečo vyhadzujete to ovocie? \r\n- Keď ja tak neľúbim solené banány!', 230, 3.06, 33),
	(7448, '"Susedko, videli ste, akého strašiaka si sused postavil na pole?"\r\n"Nie."\r\n"Takého strašného, že mu vrany vrátili aj minuloročnú úrodu."', 146, 2.38, 33),
	(7449, 'Do prístavu pláva loď, no móle stojí Čukča a kričí:\r\n"Heeslooo!"\r\n"Choď do riti!"\r\nA Čukča si len tak pre seba povie:\r\n"To je zaujimavé, koľko rokov tu už bývam a heslo je stále rovnaké."', 205, 2.58, 33),
	(7450, 'Idú nemeckí turisti cez východné Slovensko a pýtajú sa koscov na poli:\r\n- Košice, košice?\r\nOni im odpovedajú:\r\n- Košime, košime.', 139, 3.39, 33),
	(7451, 'Kohn v Izraeli zastane pred obchodom s hodinkami. Páčia sa mu jedny a chce si ich kúpiť. Vojde preto do predajne.\r\n- Prosím si hodinky značky tej a tej čo máte vo výklade.\r\nPredavač mu odpovie: \r\n- My nepredávame hodinky, ale robíme obriezku.\r\n- Tak prečo máte vo výklade hodinky?\r\n- Prosím Vás a čo máme dať do výkladu?', 341, 3.49, 33),
	(7452, 'Gynekológ po náročnom dni ide po ulici a mrmle si:\r\n- Samé tváre, ľudia, och to je super...', 97, 2.97, 33),
	(7453, 'Sedí muž so ženou na predstavení Labutieho jazera. Žena sa nakloní k mužovi a pýta sa:\r\n- Prosím ťa, prečo tie ženy stále behajú po špičkách?\r\n- No vieš, to je predstavenie o labutiach, určite je tam nasrané!', 228, 3.5, 33),
	(7454, 'Stretne Yetti suseda:\r\n- Počuj, tu v novinách čítam, že ten Messner snáď naozaj existuje.', 96, 3.46, 33),
	(7455, 'Nápis na toalete: "Miloval som sa s tvojou matkou!" \r\nPod tým pripísané inou rukou: "Choď domov otec, si opitý."', 118, 3.05, 33),
	(7456, 'Nápis na WC:\r\nPristúpte prosím bližšie k pisoárom, lebo to, čo držíte, je oveľa menšie než si myslíte. ĎAKUJEME!!!', 128, 3.02, 33),
	(7457, 'Sedia dvaja starci na lavičke a jeden si sťažuje druhému:\r\n"Človeče, ja ti mám takú sklerózu,že síce viem, že som byl zranený vo\r\nvojne, ale už neviem, či to bolo v prvej alebo až v tej druhej svetovej."\r\n"To ja si síce pamätám, že ja som bol zranený v tej prvej, ale neviem, či som dostal guľkou medzi lopatky, alebo lopatkou medzi guľky."', 364, 3.39, 33),
	(7458, 'Dvaja stroskotanci na loďke zomierajú smädom, keď tu vylovia z mora flašu. Ten čo ju vytiahol, ju nedočkavo s trasúcimi sa rukami odšpuntuje. Z flaše vyletí džin:\r\n"Za to, že si ma oslobodil, ti splním jedno želanie."\r\n"Chcel by som more piva!"\r\nCink! Džin zmizol, more zmenilo farbu z azúrovej na zlatistú, aj peniť začalo nejako lepšie. Druhý stroskotanec ochutná:\r\n"Fakt, je to pivo. Ale aj tak si blbec! Kam budeme teraz chodiť cikať, do loďky?"', 475, 2.35, 33),
	(7459, 'Dvaja koktavý kradnú motorku said-ku a jeden hovorí druhému:\r\n- Keď nás bbbbudú nanananaháňať popopolicajti, tak mi to popovedz.\r\nA druhý na to:\r\n- Ale kým ti to ppppoviem, tak nás chchchytia, tak lllen zazazakukám, dddobre?\r\n- Ddddobre.\r\nIdú a zrazu:\r\n- Kukuku...\r\nTak vodič pridá. Ale ten druhý stále len "kukuku". Tak pridá naplno, ale on stále hovorí kukuku. \r\n- Čo ti šibe, veď tá motorka už viac nevytiahne.\r\nA ten druhý v said-ke:\r\n- Kukukurva tá said-ka nemá dno.', 501, 3.33, 33),
	(7460, 'Do rádia sa dotelefonuje poslucháč a hovorí:\r\n- Našiel som peňaženku, bolo v nej 25000,-, spolu s menom a adresou majiteľa.\r\n- To znamená, že mu ich zrejme chcete vrátiť.- hovorí moderátor\r\n- Nie, nie, nie, ja len som mu chcel dať zahrať pesničku a že ďakujem.', 279, 3.5, 33),
	(7461, 'V kine leži človek rozvalený na troch sedadlách.\r\nPríde k nemu uvádzačka a pýta sa:\r\n- Preboha, čo to má znamenať? To predsa nemôžete, kde Vás učili takto sa správať. Kto ste, odkiaľ ste prišli?\r\n- Z balkóna.', 228, 3.29, 33),
	(7462, '"Vážení hostia, nesadajte si, prosím, na tento divan. Je plný ploštíc."\r\n"Tak prečo ho nevyhodíte?"\r\n"Skúšal som. Ale tie potvory ho zakaždým prinesú nazad!"', 171, 3.22, 33),
	(7463, 'Saddám Husajn telefonuje do Washingtonu:\r\n- Georg, v mene celého irackého ľudu príjmi našu úprimnú sústrasť a adresuj ju všetkým pozostalým obetí katastrofy raketoplánu Columbia.\r\nBush:\r\n- Akej katastrofy? Raketoplán je stále na orbite.\r\n- Aha, tak nič, zavolám neskôr.', 289, 3.36, 33),
	(7464, 'Idú dvaja kanibali a nesú kostru.\r\nZastaví ich pralesný policajt a pýta sa ich.\r\n- Čo to nesiete?\r\n- Ále nič,iba odpad.', 127, 3.1, 33),
	(7465, 'Ešte nikdy som nič nedokončil, ale...', 40, 3.86, 33),
	(7466, 'Bača pred súdom:\r\n- Čím ste zabili toho valacha?\r\n- Novinami.\r\n- A čo v nich bolo?\r\n- Neviem, ešte som ich nečítal.', 123, 3.84, 33),
	(7467, 'Skinhead príde do pekárne a prosí si chlieb. \r\nPredavač sa pýta: \r\n- Čierny alebo biely?\r\n- Neser ma!', 107, 4.03, 33),
	(7468, '- Chcem si kúpiť glóbus.\r\n- Nech sa páči.\r\n- V inej farbe nemáte?', 71, 3.56, 33),
	(7469, 'Pýta sa turista indiána:\r\n- Koľko dreva potrebujete na dymové signály?\r\n- Podľa toho, či ide o miestny alebo medzimestský hovor.', 136, 3.55, 33),
	(7470, 'Chcel by som dať zahrať stávkujúcim železničiarom pesničku od skupiny Horkýže Slíže - VLAK.', 102, 2.77, 33),
	(7471, 'Je to farebné a bliká to na stene. Čo je to? No predsa pavúk - dídžej.', 76, 3.12, 33),
	(7472, 'Hluchý sa so všetkou vážnosťou pýta slepého.\r\n- Nevidel si môj diskman?', 79, 3.07, 33),
	(7473, 'Vraví biológ biológovi:\r\n- Starec, mucha sa píše s i, alebo y?\r\nDruhý na to:\r\n- Spýtaj sa radšej Karola, on je zoológ.', 127, 2.97, 33),
	(7474, 'Na pláži vylovili fľašku, v nej lístoček:\r\n"Stroskotal som na pustom ostrove. Nie sú tu ani banditi, ani policajti, ani banky, ani exekútori, ani berňák, ani daňove kontroly. Bodaj ste tam všetci pokapali od závisti!"', 230, 3.14, 33),
	(7475, 'Príde cestujúci za pilotmi:\r\n"Pán kapitán, tu máte 500$, urobte looping, mám dnes narodeniny."\r\n"Nebláznite, a čo cestujúci?"\r\n"Súhlasia, každý dostal stovku."\r\nTak pilot predviedol ukážkový looping. Po chvíli sa otvoria dvere na WC, vypadne z nich zhúlený narkoman:\r\n"Sakra, dnes som to s tou dávkou prehnal, pustil som si to až za krk."', 358, 3.89, 33),
	(7476, '"Láska, to je choroba, lebo dostane človeka do postele.", hovorí študent.\r\n"Aká choroba, keď sa z nej nikto nechce vyliečiť? Láska, to je práca.", hovorí lekár.\r\n"Čo za práca, keď hlavný aktér stojí?", diví sa inžinier,\r\n"Láska je proces."\r\n"Žiaden proces, nikto nie je poškodený, naopak, obe strany sú spokojné.", hovorí právnik,\r\n"Láska, to je umenie."\r\n"Nemôže byť umenie, ked to robí každý.", tvrdi umelec,\r\n"Láska, to je veda."\r\n"Nijaká veda!", hovorí profesor,\r\n"Prečo by inak študent mohol, a ja nie?"', 548, 3.52, 33),
	(7477, 'Zvoní telefón a zo slúchadla sa ozve:\r\n"Želali ste si nechať sa zobudiť telefónom o  6:00?"\r\n"Áno."\r\n"Tak potom švihom, švihom, pretože je už pol deviatej."', 168, 3.79, 33),
	(7478, 'Nastúpi babička do autobusu, všetky sedadlá sú obsadené a priamo pred ňou sedia dvaja mládenci. Urazene sa na nich pozerá. Na to sa jeden z mládencov ozve:\r\n"Babka a máte lístok?"\r\nBabka sa prehrabe vo vrecku, vytiahne lístok a podá ho mládencovi.\r\nMládenec pozrie na listok a vypotí:\r\n"Babka,ale to máte na zadnú plošinu na státie."', 354, 3.09, 33),
	(7479, 'Chlapi sedia v krčme a rozprávajú si zážitky z ciest. Zrazu jeden vytiahol zo saka malého, 20 cm vysokého živého chlapíka, postavil ho na stôl a hovorí mu:\r\n- No, Feri, a teraz im porozprávaj, ako si toho afrického šamana poslal do zadku.', 253, 3.41, 33),
	(7480, 'Idú dve zombie popri cintoríne a prvá hovorí:\r\n- Aha, bycikel, poďme sa povoziť. \r\n- Dobre.\r\n- Ale ja si najskôr musím odskočiť.\r\nO chvíľu príde tá prvá na bycikli a na chrbte má dva náhrobné kamene.\r\n- Pre boha, načo sú Ti tie náhrobné kamene?\r\n- Hádam chceš chodiť po meste bez dokladov?', 314, 3.28, 33),
	(7481, 'Kde iní končia, my začíname.\r\nZn. Hnilobné procesy.', 56, 3.04, 33),
	(7482, 'Skončí sa jadrová vojna. K poslednému živému človeku prichádza opica. Chvíľu sa na neho pozerá, potom schytí palicu, tresne ho po hlave a hovorí si: \r\n- No čo, začneme opäť od začiatku.', 203, 3.31, 33),
	(7483, 'Viete prečo Kennyho rodina umiera od hladu?\r\nPretože každý deň musia platiť za pohreb!', 92, 2.77, 33),
	(7484, '- Včera som bol s Tvojou manželkou. \r\nHovorí kamarát kamarátovi. \r\n- Rozprával som jej vtip. Tak sa smiala, že skoro spadla z postele.', 141, 3.22, 33),
	(7485, 'Traja králi sa prídu pozrieť do Betlehéma na jezuliatko. Ako ho tak obzerajú, jeden z nich vraví:\r\n"Jezišikriste, ten je ale krásny."\r\nJozef sa buchne po čele a vraví Márii:\r\n"Vidíš, to je meno a nie Hugo!"', 219, 3.37, 33),
	(7486, 'Ide cowboj púšťou a je veľmi smädný a unavený. Uvidí tabuľu, na ktorej je napísané "AK PREJDEŠ 100 METROV, USCHNEŠ". Ale on sa nebál a išiel ďalej. A tam uvidel druhú tabuľu, na ktorej bolo napísané "AK PREJDEŠ ĎALŠÍCH 100 METROV, USCHNEŠ". Takto prešiel celé kilometre, až sa dostal k jednému domu. Na dverách bolo napísané "AK VOJDEŠ, USCHNEŠ". Napriek tomu vošiel. V dome našiel truhlicu. Na nej bolo napísané "AK JU OTVORÍŠ, USCHNEŠ". Ale napriek tomu ju otvoril a takto otvoril ešte veľa truhlíc, až sa dostal k úplne maličkej truhličke. Otvoril ju a tam bol nápis: "TO SI SA ALE BÁL, ČO?!"', 646, 2.98, 33),
	(7487, 'Vážení cestujíci, vítame vás na palube našeho letadla. Podívate-li se\r\nvpravo, uvidíte velké město. Podívate-li se vlevo, uvidíte malé město. Podívate-li se pod sebe, ne přátelé, to nejsou obláčky, to jsou padáky naší posádky, která se s vami tímto louči a přeje vám příjemný zbytek letu.', 321, 3.18, 33),
	(7488, 'Viete, čo si spieva Karel Gott keď hľadá slipy?\r\n"Kdepak ty ptáčku hnízdo máš...?"', 91, 3.42, 33),
	(7489, '"Vravíte, že vám utiekol pes? A ako vyzeral?"\r\n"Strednej veľkosti, hnedý. Keď naňho zavoláte:\r\n"Poď sem, Brok! A on nejde, znamená to, že je môj."', 158, 3.08, 33),
	(7490, 'Kapitán lietadla, ktoré preváža reprezentačné futbalové mužstvo vrazí do kabíny pre cestujúcich a reve:\r\n- Chlapi, prúser, ktorý z vás je ľavé krídlo? Naše sa práve odtrhlo.', 192, 3.2, 33),
	(7491, 'Icík je na návšteve u Kohnovcov. Akosi sa zakecali a Icík zmeškal posledný autobus. Lenže u Kohnovcov je iba jedna posteľ a Sára pekná ženská. Ako to vyriešiť?\r\n- Sára, ty si ľahneš k stene, ja vedľa teba a Icík vedľa mňa.\r\nPovedali, stalo sa. Ráno sa Icík lúči a hovorí potichu Kohnovi:\r\n- Počúvajú, tá ich Sára ale je pekná potvora! Celú noc ma držala za vtáka.\r\nKohn sa usmeje a povie:\r\n- Ale, to som bol ja, vedia, zicher je zicher!', 471, 3.44, 33),
	(7492, '- Mojse, spíš?\r\n- Spím Sara, spím...\r\n- A čo to mám také tvrdé medzi nohami?\r\n- Aj-vaj, prepáč, hneď vytiahnem...\r\n- Teraz, uprostred noci? Nič nevyťahuj a spi ďalej!', 180, 2.95, 33),
	(7493, '- Koľko je dva plus dva?\r\n- Štyri.\r\n- Nie. Päť s DPH.', 57, 3.17, 33),
	(7494, 'Traja zosnulý sa poberajú do nebies. Aby zmazali všetky hriechy čo napáchali, musia vytrpieť zlo, čo napáchali pri remesle. Prvý bol obuvník, druhý bol krajčír a tretí cukrár. Vstúpil prvý. Bolo počuť krik. Keď vyšiel, tak sa ho tí dvaja pýtali čo mu robili.\r\n"Niečo strašné, priklincovali mi na nohy topánky."\r\nIšiel druhý do vnútra. Bolo počuť veľký krik. Keď vyšiel, tak sa ho\r\nobuvník s cukrárom spýtali čo mu robili.\r\n"Niečo strašné, prišívali mi oblek na telo."\r\nCukrár povedal:\r\n"Čo už mne len môžu urobiť, veď som bol len cukrárom."\r\nVošiel dnu. Bolo počuť strašný krik. Ked vyšiel, tak sa ho tí dvaja spýtali:\r\n"Čo ti robili, keď si tak strašne vrieskal ?"\r\nCukrár na to:\r\n"Ani sa nepýtajte. Šlahali mi vajcia."', 788, 4.05, 33),
	(7495, 'Ako sa robí  business ...\n\r\nJack, prefíkaný businessman, hovorí synovi.\r\nJack:  "Vezmeš si dievča, ktoré ti vyberiem ja."\r\nSyn: "Ja si sám vyberiem  nevestu!"\r\nJack: "Ale to dievča je dcéra Billa Gatesa."\r\nSyn: "Ok, tak v tom  prípade..."\n\r\nĎalej Jack navštívil Billa Gatesa.\n\r\nJack: "Mám ženícha  pre tvoju dcéru."\r\nBill Gates: "Ale moja dcéra je príliš mladá na  vydaj!"\r\nJack: "Ale tento muž je viceprezident Svetovej Banky."\r\nBill Gates:  "Oh, v tom prípade ..."\n\r\nNakoniec Jack ide pozrieť prezidenta Svetovej  Banky.\n\r\nJack: "Chcem doporučiť jedného mladého muža na  miesto viceprezidenta." \r\nPrezident: "Ale ja už mám viac viceprezidentov, ako  potrebujem!"\r\nJack: "Ale tento muž je zať Billa Gatesa."\r\nPrezident: "Ah, v  tom prípade..."', 779, 3.36, 33),
	(7496, 'Príde Janko za MacGyverom a hovorí mu: \r\n- Hej Mac, sprav mi auto, ale taký poriadny Cabriolet, ktorý má aspoň osem valcov.\r\nA MacGyver mu na to povie: \r\n- Daj mi papierik od žuvačky.', 191, 3.04, 33),
	(7497, 'Príde Donald za Držgrošom a Držgroš mu hovorí:\r\n"Pracuješ u mňa veľa rokov a preto som sa rozhodol dať ti odmenu, tu je šek na 1000 káčeroviek. A keď budeš dalej takto usilovne pracovať,podpíšem ho."', 217, 3.44, 33),
	(7498, '- Mišo, prečo si stále nachladnutý?\r\n- Vediem studenú vojnu.', 65, 2.93, 33),
	(7499, 'Americký film:\r\n"How do you do?"\r\n"All right!"\r\nV pozadí amatérsky preklad:\r\n"Ako si to robíš?"\r\n"Vždy pravačkou!"', 121, 3.65, 33),
	(7500, 'Príde muž k psychiatrovi a hovorí: \r\n- S mojou ženou sa to nedá vydržať, lebo doma chová 50 mačiek a je tam veľký smrad. \r\n- A prečo neotvoríte okno? \r\n- Čo, aby mi uletelo mojich 100 holubov?', 206, 3.51, 33),
	(7501, 'Pýtajú sa 90 ročného dedka, ako začína deň.\r\n- No, normálne, vyčúram sa, vyseriem sa a potom vstanem.', 111, 3.23, 33),
	(7502, 'Dvaja utekajú:\r\n- Uf, uf. Ja už si necítim nohy.\r\n- Tak si čuchni k mojim.', 78, 3.4, 33),
	(7503, 'Viete, čo znamená vytrvalosť?\r\nKeď hodíte do bazéna 100 kg činku a čakáte, kedy sa vynorí.', 100, 2.97, 33),
	(7504, 'Ide hrbatý v noci po lese a zrazu počuje: "Čo máš? Čo máš?" \r\nZľakne sa a beží ďalej. Ale zasa sa ozve ten čudný hlas: "Čo máš? Čo máš?" Hrbatý sa ozve:\r\n- Hrb.\r\nČudný hlas povie: "Tak už nemáš!" \r\nŠťastný beží domov za svojim bratom, ktorý je na vozíčku a hovorí mu:\r\n- Choď do lesa a keď sa ti ozve čudný hlas, tak sa mu zver, že máš vozíček. Tak ide do lesa a keď sa mu ozve čudný hlas, tak pozorne počúva: "Čo máš? Čo máš?" Zľakne sa a začne vozíčkovať preč. Po chvíli sa zasa ozve čudný hlas: "Čo máš? Čo máš?" Chlap na vozíčku mu povie:\r\n- Nič.\r\nA čudný hlas povie: "Tak máš hrb."', 663, 3.22, 33),
	(7505, '- Veža, tu Boeing 747 na trase Boston - New York, vypadli nám všetky motory, čo mame robiť?? Opakujem! Veža, tu Boeing 747 na trase Boston - New York, vypadli nám všetky motory, čo mame robiť? Ozvite sa!!!\r\n- Tu veža, nekričte, kľud, už si vás škrtám...', 270, 3.48, 33),
	(7506, 'Východniar v Prahe vychádza z hotela a na ulici sa mu prihovorí černoška:\r\n- Pane, nechcete si zajít ke mně domů?\r\n- Čo som šaleny, no neznám čo už by som ja robil v Afrike!', 186, 3.26, 33),
	(7507, '- Počuj, ty brďo, odkedy sa ti tak dobre darí?\r\n- Odvtedy ako som začal predávať poštové holuby. Super biznis...\r\n- A to ich máš toľko?\r\n- Čoby... Mám ich len desať. Cez deň ich predám a oni sa v noci vždy vrátia späť.', 238, 3.08, 33),
	(7508, 'V autobuse revízor kontroluje cestovné lístky. Zastaví sa okolo Pištu a pýta sa ho:\r\n- Váš lístok!\r\n- Môj lístok?\r\n- Váš lístok!\r\n- Môj lístok?\r\n- Človeče, čo ste hluchý?\r\n- A vy ste čo, doktor?', 215, 3.24, 33),
	(7509, 'Idú dve kostry po cintoríne, jedna drží urnu pod pazuchou a druhá sa jej pýta: \r\n"Počuj, kde si zohnala to GRANKO!"', 122, 2.99, 33),
	(7510, 'Dvaja na stanici:\r\n- Chcel by som dva lístky na vlak.\r\n- Kam to chcete?\r\n- Sem, do ruky. \r\n- Ale kam cestujete?\r\n- Na svadbu.\r\n- Kde bude tá svadba?\r\n- Keď bude pekne, tak vonku, keď bude škaredo, tak vnútri.\r\nPokladníčka sa už rozčúli:\r\n- Existuje na tomto svete ešte niekto sprostejší ako vy? \r\n- Švagor, hybaj sem! Volajú ťa!', 345, 3.15, 33),
	(7511, 'Otázka na Rádio Jerevan:\r\nKtoré mesto je najkrajšie?\r\nJerevan.\r\nKoľko atómových bômb treba na zničenie najkrajšieho mesta?\r\nJednu...Oprava. Najkrajšie mesto je Moskva!', 178, 3.09, 33),
	(7512, 'Čo príde po daždi?\r\nPondelok.', 32, 2.84, 33),
	(7513, 'Americkému rapperovi sa narodí dieťa. Po pár mesiacoch sedí rapperská rodinka v obývačke a malé sa ozve:\r\n- Mother!\r\nRapper hovorí:\r\n-Aha, už vie povedať pol slova!', 176, 3.38, 33),
	(7514, 'Metro. Staršia pani, nad ňou stojí mládenec, drží sa tyče a zýva, až mu praská v čeľustiach, bez toho, aby si pred ústa dal ruku. Babka naňho: \r\n- No, no, aby ste ma neprehltol! \r\nMladík s kľudným hlasom odpovie: \r\n- Hovädzie nežeriem.', 254, 3.09, 33),
	(7515, 'Máš problém? Napíš Kukovi! Paťa ti odpíše...', 52, 2.63, 33),
	(7516, 'Pravda o rodičoch: \r\nKeď si malý, naučia ťa chodiť a hovoriť a potom chcú, aby si sedel doma a držal hubu!', 115, 3.35, 33),
	(7517, 'Ahoj, ja som Chuck Norris a ja Christie Brinkleyová a obaja používame Cosmodisk, pretože sme si zničili chrbát na Total-gyme...', 133, 3.43, 33),
	(7518, 'V zoologickej záhrade mali strašne škaredú gorilu, ale vzácny exemplár. Žiadna iná gorila sa s ňou nechcela páriť, taká bola ohyzdná. Riaditeľ ZOO sa dozvedel, že na istom salaši existuje bača, ktorý "by jej to urobil". Baču priviezli do ZOO, ten si ju dlho obzeral a hovorí:\r\n- Mám tri podmenky. Po prvé, bozkávať sa s ňu nebudem. Po druhé, keď tak, tak len zezadu. \r\n- A tretia podmienka ? - pýtajú sa v ZOO.\r\n- Včul nemám peňáze, zaplatím až po výplate.', 492, 3.34, 33),
	(7519, 'Viete, ako straší Bin-Ladin svoje deti doma?\r\nBU BU BU BU... BUSH!', 68, 3.45, 33),
	(7520, '"A predsa sa točí!" povedal Giordano Bruno po desiatej čaši vína.', 70, 3.22, 33),
	(7521, 'Najkratší srbský pozdrav:\r\n- Stoj, lebo strelím!\r\n- Stojím!\r\n- Strieľam!', 78, 3.23, 33),
	(7522, 'Sedí skín s frajerkou na lavičke a frajerka hovorí:\r\n- Nemohol by si si sadnúť bližšie?\r\nSadne si.\r\n- Nemohol by si mi dať ruku okolo pliec?\r\nDá.\r\n- Nemohol by si ma pobozkať?\r\nPobozká ju.\r\n- A nemohol by si urobiť niečo z vlastnej iniciatívy?\r\n- A to ti mám zlomiť ruku, alebo čo?', 299, 3.71, 33),
	(7523, 'Prečo Boh stvoril blondínky?\r\nPretože ovca pivo z chladničky neprinesie.\r\nA prečo brunety?\r\nPretože blondínka tiež nie.', 127, 3.27, 33),
	(7524, 'Chlapík ide domov z práce a tu vidí na chodníku sedí bezdomovec a má jednu ruku vystretú. Chlapík si myslí \'Je to chudák, pomôžem mu\' a hodí mu päť korún a pokračuje. Na druhý deň to isté. Hodí mu päť korún a pokračuje. Tretí deň sa to opakuje. Keď však ide domov z práce na štvrtý deň, bezdomovec má vystreté obe ruky. Chlapík sa pristaví a pýta sa ho, že prečo. Bezdomovec mu odpovedá: \r\n- No, obchody idú, tak som sa rozhodol, že si otvorím pobočku.', 497, 2.99, 33),
	(7525, '- Milujem prírodu.\r\n- Aj preto, čo ti urobila?', 48, 2.99, 33),
	(7526, 'J: Počuj, dnes je výročie oslobodenia toho polského koncentráku.\r\nP: Ále, ani mi to nespomínaj. V koncentráku zahynul môj otec.\r\nJ: Fakt? A čo, zastrelili ho,  alebo išiel do plynu?\r\nP: Spadol zo strážnej veže.', 224, 3.31, 33),
	(7527, 'Ide chlapík po ulici a zrazu sčista-jasna sa nad ním ozve hlas:\r\n"Kúp si lós!"\r\nMuž sa aj zľakne, poobzerá sa naľavo-napravo, nikde nikto a pomyslí si, že sa mu to zdalo. O chvíľku zas ten istý hlas:\r\n"Kúp si lós!"\r\nOpäť nikto naokolo. Chlap si strelí facku, či sa mu to nesníva. Nesníva, lebo o chvíľu opäť ten istý nástojčivý hlas:\r\n"Kúp si lós!"\r\nTak si pomyslí, že možno je to naozaj jeho životná šanca na výhru, rýchlo uteká do sazky, a kúpi si lós. Vyjde na ulicu, zotrie a hlas nad ním:\r\n"Do riti..."', 551, 3.43, 33),
	(7528, 'Srdcová porážka a mozgová porážka sa stavia, ktorá z nich je účinnejšia. \r\n- Počkaj, uvidíš ma v akcii, - hovorí tá srdcová \r\nZa chvíľku ide muž okolo, skočí naňho, ten zalapá po dychu, čistý infarkt, exitus.\r\n- To nič nie je, uvidíš teraz mňa, - chváli sa mozgová príhoda.\r\nZa chvíľu ide okolo žena, mozgovica sa na ňu vrhne a nič. Skáče znova a znova a furt bez výsledku.\r\n- Do riti, to zrovna ja som musela natrafiť na blondínku...', 476, 3.53, 33),
	(7529, 'Ako poznáte dieťa splodené po použití viagry?\r\nMá modré oči a kadetade postáva.', 88, 3.17, 33),
	(7530, 'Partia vedcov sa rozhodla, že nájde najstaršieho človeka na svete a tak sa vybrali do Himaláji. Tam po rokoch hľadania zbadali veľmi starého človeka s dlhou bielou bradou. Podišli k nemu a pýtajú sa ho:\r\n- Ujo, koľko máte rokov?\r\n- 156 \r\n- A nechceli by ste ísť s nami do USA, aby sme vás ukázali svetu?\r\n- Rád by som, mládenci, ale otec ma nepustí!', 370, 3.35, 33),
	(7531, 'V sedemnástich sa začína meniť dievčatám hlas z "Nie" na "Áno".', 70, 3.59, 33),
	(7532, 'Stretne kladivo klinec. Kladivo hovorí:\r\n- Klinec, kam ideš?\r\n- Do sveta.\r\n...buch...buch...\r\n- Nikam nejdeš!!!', 114, 3.28, 33),
	(7533, '- Tati, čo robíš v tom chlieve?  \r\n- Ukazujem tete Eve aké je prasa!', 72, 3.21, 33),
	(7534, 'Karol IV sa prechádza po svojom hrade a zrazu vidí, že všetci dvorania sú opití.\r\n- Čo to má znamenať? - rozhorčuje sa a rozhadzuje rukami Karol IV.\r\n- Vaše veličenstvo, my oslavujeme vaše meniny.\r\n- Ale veď dnes nie je Karola.\r\n- To nie, ale je štvrtého.', 271, 3.55, 33),
	(7535, 'Išli dvaja na motorke a narazili do stromu. Jeden hovorí:\r\n- Jaj moje kríže.\r\nDruhý hovorí:\r\n- Čo tvoje kríže, ale moje gule v reťazi.  ', 146, 3.28, 33),
	(7536, 'Na brehu ostrova stojí zarastený bradatý muž a máva rukami na loď plávajúcu okolo. \r\n- Kto je to?, pýta sa jeden pasažier kapitána. \r\n- Neviem, ale vždy sa takto teší, keď ideme okolo.', 199, 3.43, 33),
	(7537, 'Ako sa hovorí tomu zbytočnému kusu kože na konci penisu?\r\nMužské telo.', 76, 3.02, 33),
	(7538, 'Čo vznikne, keď sa skríži včela s prasaťom?\r\nSlovák.\r\nPracovitý, ale sviňa.', 84, 3.17, 33),
	(7539, 'Ako sa volá pes Bin Ladina?\r\nAl-Pajda.', 39, 2.85, 33),
	(7540, 'Na divokom západe chlapík vkročí do lokálu a na zemi vidí dostrieľaného muža. Pýta sa ostatných:\r\n- Hráč, že?\r\n- Áno, áno.\r\n- Falošný hráč, že?\r\n- Áno,áno.\r\n- Karty?\r\n- Nie, husle.', 203, 3.53, 33),
	(7541, '- Raz som bol v múzeu, kde vystavovali také ruky a nohy, ktoré chýbali zo sôch v iných múzeách.', 103, 2.72, 33),
	(7542, 'Hašišák si dá poriadneho jointa, potom druhého, tretieho. Takto naladený vyjde na balkón. Chvíľu tam stojí a zrazu vidí ako pred ním preletí žeravá guľa. Pokrúti hlavou a čaká čo bude ďalej. O chvíľu zasa preletí žeravá guľa a o nejaký čas znovu. Zrazu vyjde na balkón jeho kamarát, poklepe ho po pleci a hovorí: \r\n- Poď už dnu. Už tri dni stojíš na balkóne.', 396, 3.4, 33),
	(7543, 'Viete, aký je rozdiel medzi záchranárskym a protidrogovým psom? Záchranársky hľadá lyžiarov a protidrogový snowboardistov!', 132, 3.06, 33),
	(7544, 'Stretnú sa buzerant, feťák a alkoholik v nebi. Keď prišli na rozhrešenie, Pán Boh im hovorí: \r\n- Ak jeden s vás poruší príkaz (ak sa alkoholik opije, ...) pôjdete do pekla.\r\nTak idú všetci traja po nebi a naraz alkoholik zbadá na zemi fľašu, zdvihne ju a opije sa do nemoty. A šup, už je v pekle. Po troch dňoch sa prechádzajú po nebi buzerant s feťákom. Zrazu feťák zbadá na zemi striekačku a buzerant mu hovorí:\r\n- Zohni sa preto a sme v pekle obidvaja.', 485, 3.23, 33),
	(7545, '- Nemám rad ľudí, ktorí beru drogy. Najmä colníkov.', 57, 3.36, 33),
	(7546, 'V škôlke:\r\n- Jožko, aké máš skladačky?\r\n- Piko, hero, koks...', 68, 3.28, 33),
	(7547, ' Dedko sa pozerá z balkóna a krúti hlavou:\r\n- Tí študenti sú dnes takí chudobní, že piati fajčia jednu fajku a ešte sa tomu aj smejú.', 145, 3.25, 33),
	(7548, 'Adam a Eva sedia v raji a húlia trávu. Adam pekne zhúlený vraví Eve: \r\n- Milujem ťa.\r\nEva na to:\r\n- Aj ja k tebe cítim takú haluz.', 138, 3.42, 33),
	(7549, 'Na Slovensko ide koncertovať skupina Prodigy. Húfy fanúšikov ich vítajú na bratislavskom letisku. Ako členovia skupiny vystupujú z lietadla, zarazene pozorujú, ako k ním ide dvojica mladých ľudí oblečených v krojoch a nesúcich chlieb a soľ. Tu sa úplne nadšene ozve bubeník skupiny:\r\n- Teda tak takto nás ešte nikto nikde neprivítal.\r\nNásledne nato si zapchá jednu nosnú dierku, nakloní sa nad soľ a silno nadýchne.', 444, 3.12, 33),
	(7550, 'Rozprávajú sa Rómeo a Júlia a pokurujú jointíka. Rómeo povie: \r\n- Ja ťa asi milujem!\r\nA Júlia:\r\n- Ja tiež cítim takú haluz!', 135, 2.9, 33),
	(7551, 'Príde chlapík domov a strašne sa poháda s manželkou. Naštvaný vyjde na balkón a ušúľa si jednu marihuanu. Vyhúli ju a pozerá ako zrazu letí po oblohe žltý kotúč. Zmôže sa iba na:\r\n"Wwwoooooowww..."\r\nTak si rýchlo dá druhého a zrazu kotúč znova preletí po oblohe. Chlap zasa iba:\r\n"Wwwwwoooowww..."\r\nCelý hotový si dá tretieho. Žltý kotúč zas prejde po oblohe. Celý vyjašený vbehne dnu a žena mu hovorí:\r\n"No bolo na čase, vrátiť sa po troch dňoch!"', 490, 3.64, 33),
	(7552, 'Sedí si dedko v parku na lavičke, keď zrazu ide okolo neho partia chlapcov. Hovorí si:\r\n- Piati s jednou cigaretou a ešte im je do smiechu...', 146, 3.27, 33),
	(7553, 'Prečo ľudia pijú a potom šoférujú, keď môžu húliť a lietať?', 71, 3.24, 33),
	(7554, 'Vieš čo je v Amerike diskriminácia? Deň nezávislosti. A čo chudáci závislí?', 84, 3.15, 33),
	(7555, 'Sex je ako droga. Keď to na vás príde, tak si jednoducho musíte pichnúť. ', 79, 3.21, 33),
	(7556, 'Viete, čo je absolútna pohroma pre narkomanov? Plastové lyžičky. ', 70, 3.31, 33),
	(7557, 'Babka vraví vnukovi:\r\n- Sníval sa mi sen, že som lietala nad mestom sem a tam, všetko malo nádherne farby...\r\nVtom jej vnúčik hovorí:\r\n- Babka, koľko krát som ti vravel, že tvoje tabletky sú v tej krabičke vedľa.', 226, 3.06, 33),
	(7558, 'Kedy prežíva narkoman najťažšie obdobie?\r\nKeď nerastie tráva.', 68, 2.81, 33),
	(7559, 'Príde chlapík do sauny, vyzlečie sa dohola, uloží si veci do skrinky, zamkne skrinku a na krk si zavesí klúčik od skrinky na špagátiku. Konečne sa dotrepe do sauny, sadne si  a začne si vegetiť. Keď zrazu vojde dovnútra taký istý magor tiež s klúčikom na krku. Tiež sa usadí, a potom si začne baliť poriadne tlstého jointa. Zapáli, dá si zopár práskov a potom ponúkne chlapíkovi:\r\n"Šak si daj aj ty zopár práskov."\r\n"Ááále, nééé, ja nehulím."\r\n"A šak si daj."\r\nNo tak si dá zopár dobrých práskov, keď vtom zrazu ten druhý chlapík vyskočí, strhne mu z krku klúčik aj so šnúrkou a rozbehne sa vom. Dobehne ku skrinke, oblečie sa a tomu magorovi vykradne celú skrinku, nasadne do auta a odfrčí. Chlapík najskôr nechápavo pozerá, ale potom holý vybehne von, rýchlo zastaví najbližší taxík a hovorí taxikárovi:\r\n"Nasledujte to auto!"\r\nTak teda sa naháňajú, naháňačka po celom meste, ale nakoniec mu maník zdrhne. Tak taxikár hovorí:\r\n"No tak chlape, zaplať."\r\n"Veď nemám peniaze, som holý, veď mi zdrhol!"\r\nTak taxikár odvezie chlapíka do lesa a tam ho dobre zmláti a nechá tak a odfrčí. Ráno sa chlapík prebere, celý je domlátený, ešte aj na WC sa mu chce, tak si hovorí ja to kašlem, tak sa aspoň vyprázdnim. Keď v tom zrazu mu niekto položí na plece ruku a hovorí:\r\n"Hej, ty magor, sauna nie je WC!"', 1403, 3.23, 33),
	(7560, 'Na brehu rieky sedia dvaja zhuleni narkomani. Príde k nim jeep:\r\n"Chlapi, kde je tu najbližší brod?"\r\n"Presne tam, kde stojíte."\r\nJeep vošiel do vody, po pár metroch sa potopil, šofér len tak-tak stihol vyplávať:\r\n"Boha vášho! Tomu hovoríte brod?"\r\n"To je zaujímavé, pred chvíľou tam prechádzali husi a mali vodu len po pás."', 345, 3.31, 33),
	(7561, 'Ide feťák okolo mora a na brehu vidí metať sa zlatú rybku. Tá naňho kričá, že ak ju hodí naspäť do mora splní mu 3 želania. Feťák ju teda kopne do mora.\r\nIde prvý deň a rybka naňho:\r\n- Praj si prvé želanie.\r\nFeťák nahlas rozmýšľa:\r\n- Ja všetko mám, nič nepotrebujem, tak si teda šlahnime.\r\nŠlahnú si a to sa opakuje po tri dni.\r\nNa štvrtý deň sa rybka vynorí a kričí na feťáka:\r\n- Feťák, nešlahneme si?', 446, 3.42, 33),
	(7562, 'Sedí Kubko s Maťkom pri ohníku a fajčia marihuanu.\r\nZ neba zostúpi Boh a príde k nim. Chvíľu spoločne pofajčievajú a potom sa Kubko spýta:\r\n"A Ty číže si synak?"\r\nBoh odpovie:\r\n"Ja som Pán Boh."\r\nMaťko na to:\r\n"Ej dobrá je, dobrá!"', 250, 3.41, 33),
	(7563, 'Stará mama sa pozerá na fľak od jedla na obruse a vraví:\r\n- Ako to teraz očistím, keď môj vnúčik prestal fetovať?', 124, 3.02, 33),
	(7564, 'Príde pračlovek do jaskyne a žena mu hovorí:\r\n- Och, povedz mi niečo čo som ešte od nikoho nepočula !\r\n- INTERNET - odpovedá pračlovek.', 145, 3.37, 33),
	(7565, 'Viete, aký mail má maďarská sova? \r\nhu@hu.hu', 48, 2.93, 33),
	(7566, 'Pýta sa sused suseda:\r\n- Tak čo, aká bola dovolenka?\r\n- Výborná, každý deň som surfoval.\r\n- Naozaj? A kde?\r\n- Na internete.', 131, 3.16, 33),
	(7567, 'Viete, čo je to maximálna reklama?\r\nKeď aj vo sne máte reklamné bannery.', 77, 3.26, 33),
	(7568, 'Viete, čo je to internetový tip na večeru?\r\nVé vé vé  chlieb s maslom  zavináč vodka sk!   ', 99, 3.36, 33),
	(7569, 'Programátor stretne na ulici pekne dievčatá a volá na ne: \r\n- Nazdar kočky! Máte ICQ alebo aspoň e-mail? \r\n- Nemáme. Načo by nám boli? \r\n- To je škoda, mohli sme sa zoznámiť.', 187, 3.08, 33),
	(7570, '- Už si dostal foto od tej kámošky z internetu?\r\n- Áno, ale bola taká škaredá, že sa mi spustil antivir.', 112, 3.14, 33),
	(7571, 'Pýta sa syn otca:\r\n- Je pravda, že IRC, ICQ a podobné internetové chaty zblbnu úudí?\r\n- IMHO LOL.', 103, 3.16, 33),
	(7572, 'Minule na IRC som odchytil takúto hlášku. IQ sa pýtal jedného človeka na IRC koľko váži. On mu na to odpovedal, ale zabudol dvojbodku a celá hláška vyznela nasledovne:\r\n"iq 62 - 63 podľa toho ako sa najem."', 219, 3.44, 33),
	(7573, 'Čo je to hu@hu.hu?\r\nE-mailová adresa maďarskej sovy.', 55, 3.17, 33),
	(7574, '"Tato, podívaj sa, prosím ťa, aké je tam vonku počasie!"\r\n"Moment, už to píšem: http://weather.yahoo.com ."', 115, 3.35, 33),
	(7575, 'Závislák a závisláčka sedia uňho na gauči a romanticky sledujú LEDky modemu. Zrazu závislák vykríkne:\r\n- Rýchlo, želaj si niečo, padá linka!', 155, 3.35, 33),
	(7576, 'Webmaster vyplňuje dotazník:\r\nVek: 25\r\nVýška: 185\r\nFarba očí: #22AA75', 75, 3.26, 33),
	(7577, 'Kedy je človek maximálne stratený?\r\nKeď ho ani Google nenájde.', 67, 3.19, 33),
	(7578, 'Viete čo je vrchol internetovej závislosti?\r\nKeď začínate vetu www. a končíte .com.', 90, 3.21, 33),
	(7579, 'Chváli sa jeden poľovník druhému:\r\n- Ja som včera strelil takého diviaka, že poňho musel prísť traktor. \r\n- Ha, to nie je nič. Ja som zostrelil takého vtáka, že z neho vystúpilo 360 ľudí.', 204, 3.24, 33),
	(7580, 'Traja polovníci sa stretnú v lese a dohadujú sa, kto uloví väčšieho medveďa. Po dvoch dňoch sa opäť stretnú. Prvý hovorí:\r\n- Ja som išiel do lesa a uvidel som malú dieru. Zakričal som bu-bu-bu, vybehol medveď a bummm.\r\nDruhý hovorí:\r\n- Ja som išiel do lesa a uvidel som väčšiu dieru. Zakričal som bu-bu-bu, vybehol vačší medveď a bummm-bummm.\r\nO chvíľu prišiel Dežo celý v sadre a hovorí:\r\n- Ja som išiel do lesa a uvidel som najväčšiu dieru. Zakričal som bu-bu-bu a vyrútil sa na mňa Košický rýchlik.', 546, 3.01, 33),
	(7581, 'Hovorí poľovník v krčme:\r\n- Najfalošnejsie zviera je líška. Nedávno som celý deň jednu sledoval a keď som ju zastrelil, zistil som, že je to pes.', 157, 2.92, 33),
	(7582, 'Frank bol veľmi šťastný, keď dostal do daru loveckú pušku a okamžite sa vybral loviť medvede. Po chvíľke čakania zbadá menšieho hnedého medveďa, zacieli a jednou ranou ho skolí. Zrazu mu niekto klepe po pleci. Veľký čierny medveď.\r\n"Počuj Frank, teraz si ma nasral. To si odskáčeš. Buď ťa roztrhám v zuboch, alebo ťa pretiahnem. Vyber si."\r\nFrank si povie, že radšej stratiť česť ako život a podvolí sa. Dva týždne sa z toho lieči, potom sa nahnevaný vyberie do lesa, počká si na čierneho medveďa a zastrelí ho. Zrazu mu niekto klepe po pleci. Obrovský medveď grizzly.\r\n"Počuj Frank. To si odskáčeš. Buď ťa roztrhám v zuboch, alebo ťa pretiahnem."\r\nFrank nechce umrieť a tak sa opäť podvolí. Dva mesiace bolestivej maródky. Potom sa zaslepený pomstou vyberie do hôr, počká si na grizzlyho a jednou ranou ho odbachne. Zrazu mu niekto klepe po pleci. Veľký biely medveď ľadový.\r\n"Priznaj sa Frank... Že ty sem nechodíš kvôli poľovačke?"', 1009, 3.54, 33),
	(7583, 'Ako zastreliť jelena: \r\nPotrebujete príručku na chytanie jeleňov, pušku, čistinku a jeleňa. Prídete na čistinku s jeleňom, nalistujete si v príručke ako zastreliť jeleňa, nabijete, zamierite a zastrelíte jeleňa.\r\nAko zastreliť medveďa: \r\nPotrebujete príručku na chytanie jeleňov, pušku, čistinku, elektrikárske stupačky, ihlicu, dve esá a medveďa. Prídete na čistinku s medveďom, ukážete mu prostredník, medveď sa za vami rozbehne, obujete si stupačky, vyleziete na strom a medveď vybehne za vami. Zoberiete ihlicu, pichnete ho do oka. Medveď skríkne "moje oko", vy vytiahnete dve esá a poviete "ja mám kráľovské". Medveď sa tresne po čele a povie "ja som z toho jeleň". V príručke ako zastreliť jeleňa si nalistujete, ako zastreliť jeleňa, nabijete, zamierite a zastrelíte medveďa.', 836, 3.17, 33),
	(7584, 'Poľovník prichytil v lese chlapa s autom a v jeho kufri našiel jeleňa. Oboril sa na neho:\r\n- Čo to má znamenať?\r\n- Nič. To je môj pes!\r\n- A čo tie parohy?\r\n- To je jeho problém!', 188, 3.07, 33),
	(7585, 'Na poľovníckom plese. Poľovník Jožo sa staví s kamarátmi o fľašu vodky, že uhádne každý druh kožušiny. Tak mu prikyjú oči a dajú do rúk kožušinu. \r\n"Medvedia, tmavohnedá, 3 roky stará a pred rokom zastrelená, Cena 3000,- Sk."\r\nNikto tomu nemôže uveriť, že to uhádol, ale dajú mu sľúbenú vodku. Vypije ju ešte v ten večer. Ráno po opici sa zobudí a hneď naňho reve žena:\r\n"To, že ťa ožratého  dovliekli kamaráti, to ti ešte dokážem odpustiť, ale to, že si ma celú noc ohmatával a kričal: ježko za 3,50 (Sk), to ti neodpustím nikdy."', 586, 3.2, 33),
	(7586, 'Ide pytliak po lese a zabije jeleňa. Prehodí si ho cez pravé plece. Ide, ide po lese a stretne horára. Horár sa ho pýta:\r\n"Čo to máš na tom pleci?"\r\nPytliak pozrie na ľavé plece a hovorí:\r\n"Kde?"\r\n"Na druhom!"\r\n"Aha, fúj, jeleň!"', 243, 3.07, 33),
	(7587, 'Ide slepý a hluchý na poľovačku. Ako si tak vykračujú, hluchý sa potkne, spadne a vystrelí. Slepý sa nato pýta:\r\n- Trafili sme niečo?\r\n- Prečo? Už sme strieľali?', 175, 2.97, 33),
	(7588, 'Dvaja poľovníci sa vybrali na poľovačku.Ten odvážnejší sa s priateľom stavil,že uloví medveďa grizlyho. Odišiel a dlho sa nevracal. Až napokon do stanu poľovníkov strčil hlavu grizly:\r\n"Prišiel som ty len povedať, že tvoj priateľ stávku prehral!"', 268, 3.05, 33),
	(7589, 'Príde američan na poľovačku na Sibír. V odľahlej dedinke vidí ako štyria mužíci nesú uloveného medveďa na drúku. Američan sa pýta: \r\n- Grizly?\r\nNa to mu jeden mužík flegmaticky odvetí: \r\n- Net, negrizli, striľáli.', 234, 3.36, 33),
	(7590, 'Traja kovboji súťažia, kto je presnejší v streľbe. Prvý zatočí pištoľami a zastrelí koňa.\r\n- I am Jimm!\r\nDruhý zatočí pištoľami a zastrelí ťavu.\r\n- I am Herry!\r\nTretí vyhodí pištole, zatočí s nimi a odstrelí oboch kovbojov.\r\n- I am sorry!', 264, 3.2, 33),
	(7591, 'Polovník nachytá pytliaka ako nesie na pleci jeleňa.\r\n- Stoj! Čo to nesieš?\r\n- No čo asi, psa.\r\n- Tak psa... A čo tie parohy?\r\n- To je jeho problém.', 156, 3.18, 33),
	(7592, 'Chváli sa poľovník kamarátovi:\r\n- Včera som chcel poľovať na vtáky a tu zrazu uvidím medveďa. Tak som bežal a zrazu BUM a medveď bol v bezvedomí.\r\n- Fíha, ja by som sa na tvojom mieste asi posral.\r\n- A čo myslíš, na čom sa pošmykol?', 251, 3.03, 33),
	(7593, 'Ide Eskimák s Rusom na poľovačku a uvidia jeleňa. Rus ho ide zastreliť a vtom mu Eskimák povie:\r\n- Nestrieľaj a utekaj.\r\nPo  chvíli utekania Eskimák zoberie pušku a zastrelí jeleňa. Rus sa ho spýta.\r\n- A prečo som toho jeleňa nemohol zastreliť už vtedy?\r\n- A čo ti šibe? Kto by ho tak ďaleko ťahal?', 319, 3.15, 33),
	(7594, 'Išiel poľovník po lese, keď sa potkol o konár a strelil si brokovnicou rovno medzi nohy. V nemocnici ho dali akotak dokopy a po operácii lekár podáva pacientovi navštívenku. \r\n- Toto je adresa môjho priateľa. Navštívte ho, iste vám pomôže.\r\n- Aj on je lekár?\r\n- Nie, on je fujarový virtuóz. Naučí vás prstoklad, aby ste si nenačúrali medzi oči!', 370, 3.28, 33),
	(7595, 'Hrá sa pani s dieťaťom na lúke v lese, zrazu v diaľke zaznie výstrel. Dieťa padne na zem mŕtve. Pani začne v panike kričať o pomoc, keď tu po asi desiatich minútach vylezie z lesa polovník, pozrie na dieťa a hovorí: \r\n- To čumíte! Tá flinta má ale dostrel!', 276, 2.97, 33),
	(7596, 'Rozpráva starý dedko príbeh z poľovačky v Afrike:\r\n- Mierim si na leva, lev sa blíži, vystrelím a ... posral som sa!\r\n- Ale dedo, nič si z toho nerobte, to by sa stalo každému.\r\n- Ale ja som sa teraz.', 211, 3.25, 33),
	(7597, 'Stretnú sa dva zajace v lese.\r\n- Dávaj si pozor. Dnes je poľovačka.\r\n- Ale, veď polovníci aj tak nikdy nič netrafia.\r\n- To nie, ale už ma dvaja povracali.', 162, 3.13, 33),
	(7598, 'Dvaja poľovníci si rozprávajú zážitky:\r\n- Nedávno,v Afrike,zo vzdialenosti 500 metrov som jedinou strelou zabil slona.\r\n- Ja som zas pri kúpaní sa v oceáne holými rukami zahrdúsil veľrybu.\r\n- A počul si o Mŕtvom mori? Keby nie ja,ešte by žilo.', 260, 3.24, 33),
	(7599, 'Muž sa vrátil z poľovačky:\r\n"Žena moja, teraz nebudeme celý mesiac kupovať mäso."\r\n"Toľko si nalovil?"\r\n"Nie, prepil som výplatu."', 140, 3.21, 33),
	(7600, 'Žena strašne chcela íst s mužom na poľovačku.\r\n"To nie je pre ženy, je tam zima, nebezpečná príroda."\r\nAle nakoniec ho ukecala. Prišli do lesa, muž jej dal do ruky pušku:\r\n"Tu sa posadíš na posed, keď zbadáš jeleňa, strelíš ho, prídeš k nemu, položíš na neho nohu a povieš \'To je môj úlovok, nikomu ho nedam!\'"\r\nTak žena sadla do posedu a chlapi si medzitým zašli do chaty, naliali vodky a zajedali chlebom. Zrazu vonku rána \'buum\' a žensky hlas:\r\n"To je môj úlovok, nikomu ho nedám!"\r\nChlapi vybehli von, tam ženská, z hlavne sa jej ešte dymilo:\r\n"To je môj úlovok, nikomu ho nedám!"\r\nA vedľa nej horár:\r\n"No dobre, dobre, nikto ti ho neberie. Ale aspoň sedlo si odopnúť môžem, nie?"', 734, 3.1, 33),
	(7601, 'Viete, ako chytíte jeleňa?\r\nNo, nalákate ho na kus syra, zdrapíte ho za parohy a poriadne s ním  zatočíte. Jeleň ostane omráčený a potom ho jednoducho zviažete.\r\nA viete, ako chytíte medveďa?\r\nNo, zoberte si karty, do vrecka 2 esá a vyberte sa do medveďovho úkrytu. Pozvite ho na partičku očka. Prvýkrát ťahajte kartu vy a spolu s esom ju vyložte na stôl, aj keď nemáte očko. Medveď nechápe a povie: \r\n"No tak toto nepochopím."\r\nPo druhýkrat si berie kartu medveď, vyloží ju a vy ju prekryjete esom. Medveď na to povie: \r\n"A som z toho jeleň."\r\nA jeleňa už viete chytiť.', 609, 3.25, 33),
	(7602, 'Viete, ako sa na Sibíri chytajú zajace?\r\nZoberiete kameň, nasypete naň korenie  a skryjete sa za krík. Zajac príde, ovonia kameň, kýchne si a rozbije si hlavu.', 167, 3.21, 33),
	(7603, 'Hovorí pán sluhovi:\r\n- James, priprav pušku, vrece, palicu a psa guľovníka, ideme loviť orangutany.\r\nZarazený James sa pýta:\r\n- Pane a môžete mi vysvetliť, načo sú nám okrem pušky potrebné ostatné veci?\r\n- Ty truľo, ja chcem toho orangutana živého.\r\n- No dobre pane, ale stále nechápem, načo nám treba toľko vecí?\r\n- No, ako vieš, orangutany visia zo stromu na rukách. Ja vezmem palicu, vyleziem na\r\nstrom, udriem orangutana po rukách a on spadne dole, kde ty budeš čakať s vrecom a máme ho.\r\n- Pane a načo nám je potom pes guľovník?\r\n- No ak ten orangutan nespadne do vreca, tak ho pes guľovník kusne do gulí, orangutan vybehne na strom, zavesí sa a na druhý krát sa to už musí podariť.\r\n- No dobre pane a načo nám je potom puška?\r\n- No ak spadnem zo stromu prvý ja, tak potom zastreľ psa guľovníka!', 853, 4.24, 33),
	(7604, 'Poľovníci chvália svojich psov:\r\n"Minule som vyšiel na poľovačku a zistil som, že som zabudol náboje. Dal som psovi oňuchať pušku a on mi z domu doniesol náboje."\r\n"Ja som si raz zabudol pušku. Dal som svojmu psovi oňuchat náboje a doniesol mi pušku."\r\n"To je všetko nič. My sme sa raz vybrali kúpať, ale manželka si zabudla plavky. Dal som ju psovi oňuchať na príslušných miestach a za chvíľu dotiahol suseda za vajcia."', 449, 3.54, 33),
	(7605, 'Hájnik prichytil v lese chlapa s autom a v jeho kufri našiel jeleňa. Oboril sa na neho:\r\n"Čo to má znamenať?"\r\n"Nič, to je môj pes!"\r\n"A čo tie parohy?"\r\n"To je jeho problém!"', 185, 3.31, 33),
	(7606, 'V zime skoro ráno vstáva z postele potichúčky poľovník, aby nezobudil manželku a ide na poľovačku. Zoberie si psíka a vykračuje v krutej zime. Po chvíli si sám povie. \r\n- Ja hlupák v takejto strašnej zime sa mám naháňať po hore? Idem ja domov.\r\nTak príde domov a znovu sa potichúčky vracia do postele, aby nezobudil manželku. Manželka sa z polosna opýta. \r\n- Je veľká zima?\r\n- Veľká - šeptom odpovie poľovník. \r\n-  A ten môj starý somár išiel na poľovačku!', 494, 3.25, 33),
	(7607, 'Dvaja polovníci sa chvália, čo ulovili. Jeden sa pýta druhého:\r\n- Čo si ulovil ty?\r\n- Bol to veľký vták a sedelo vňom veľa ľudí.', 141, 3.21, 33),
	(7608, 'Dvaja lovci kráčajú lesom a naraz jeden z nich skolabuje a nejaví známky života. Druhý poľovník nelení a mobilom volá pohotovosť:\r\n- Môj priateľ nežije! Čo mám robiť?\r\n- Len pokoj, odpovedá hlas na druhom konci, pomôžem vám. Najprv sa musíte uistiť, že je naozaj mŕtvy.\r\nV slúchadle je chvíľu ticho a naraz sa ozve výstrel. Potom opäť zaznie poľovníkov hlas.\r\n- Hotovo. Čo ďalej?', 415, 3.27, 33),
	(7609, 'Do väzenia príde nový zločinec. Jeden z nich mu hovorí:\r\n- V pondelok máme basketbal, máš rad basketbal?\r\n- Áno, veľmi!\r\n- V utorok máme futbal, máš rad futbal?\r\n- Áno, veľmi!\r\n- Si na chlapov?\r\n- Nie, prečo?\r\n- Tak stredy nebudú pre teba! ', 257, 3.16, 33),
	(7610, 'Na súde:\r\n- Dovediem tu troch svedkov, ktorí vás videli na mieste čínu.\r\n- A ja dovediem tisíc svedkov, ktorí ma tam nevideli!', 133, 2.89, 33),
	(7611, 'Do rodinky Novákovcov príde list. Manžel ho otvorí a číta. Zrazu hovorí manželke:\r\n- Počuj, ten tvoj brat sa má v tej Amerike dobre. Tu píše, že už má elektrické kreslo.', 185, 2.81, 33),
	(7612, 'Príde žena do väzenia a hovorí bacharovi:\r\n"Nemohli by ste môjmu mužovi dať nejakú ľahšiu prácu?"\r\n"Myslíte si, že nalepovanie známok je ťažká práca?"\r\n"Nalepovanie? Mne hovoril, že kope tunel či, čo."', 222, 3.24, 33),
	(7613, 'Novák píše svojej bývalej priateľke, ktorú už naozaj dlho nevidel:\r\n"Neuveríš tomu, ale stal sa zo mňa príkladný človek. Už nefajčím, k alkoholu si ani len nečuchnem, ženy pre mňa akoby ani neexistovali, dbám len o svoju prácu. Vedela si, že mám talent na rezbárstvo? Práve vyrábam malé nábytkové doplnky, zrazu som pre ľudstvo celkom užitočný. Chodím spať už večer o deviatej, stávam ráno o piatej, každý deň pravidelne chodím na prechádzky, občas si zacvičím, avšak dúfam, že toto všetko už čoskoro skončí a hádam bude opäť nejaká amnestia..."', 604, 3.24, 33),
	(7614, 'Sedí v base narkoman, hasič a sadista. Narkoman hovorí: \r\n- Zapáliť si tak jednu cigošku. \r\nHasič sa pridá: \r\n- A potom ju uhasiť. \r\nSadista na to: \r\n- Na tvojom čele.', 177, 3.05, 33),
	(7615, 'Búcha väzeň na vráta. Príde bachar, strčí hlavu do okienka a pýta sa:\r\n- Čo chceš?\r\n- Dal by som si fľašu piva.\r\n- Hej? Na, tu máš! - povedal bachar a vrazil mu.\r\nO chvíľu zasa búcha väzeň na vráta. Príde bachar, strčí hlavu do okienka a pýta sa:\r\n- Čo chceš?\r\nVäzeň mu vrazil a povedal: \r\n- Vraciam fľašu.', 336, 2.7, 33),
	(7616, 'Sudca sa pýta obžalovaného:\r\n- Preco ste zbili toho pána?\r\n- No viete. Veľký frajer, čierne okuliare, biela palička a oklepkával mi auto!', 146, 3.04, 33),
	(7617, 'Hra milionár na súde. Sudca k obžalovanému:\r\n- Chcete ďalšiu otázku alebo vám stačia 3 roky?', 101, 3.76, 33),
	(7618, 'Vo väzení sedia dvaja väzni.Jeden z nich je malomocný. Tomu naraz odpadne noha. Tak zobere ju a vyhodí von oknom. Zrazu mu odpadne ruka. Znova len schytí a vyhodí von oknom.Odpadne mu druhá a zas len vyhodí von oknom. Ten druhý chvíľu pozoruje, znervóznie a pýta sa: "Počuj ty frajer, nechystáš sa ty náhodou zdrhnúť?"', 338, 3.19, 33),
	(7619, '- Koľko máte rokov? - spytuje sa prokurátor.\r\n- Budem mať 35. - odpovedá vrah.\r\n- Nebudete. - smeje sa prokurátor.', 120, 3.3, 33),
	(7620, 'Stretnú sa dvaja starí známi a jeden z nich je super nahodený. Nový oblek, kravata, drahý kabát, topánky a kufrík z krokodíla. Ten druhý sa ho pýta:\r\n- Asi sa ti dobre darí, keď si chodíš taký vyobliekaný.\r\n- Ale vieš, otvoril som si taký malý butik.\r\n- Héj, a s čím?\r\n- Normálka, so šperhákom.', 321, 3.2, 33),
	(7621, 'Výzva slovenským občanom:\r\nAk uvidíte Kajínka, tak mu odkážte, že DELI sa vrátila.', 91, 3.17, 33),
	(7622, 'Koktavý a malomocný sedia spolu vo vezení. Zrazu malomocnému odpadne ruka. Chytí ju a vyhodí von. Koktavy mu na to hovorí:\r\n- Zzzzzzzz...\r\nPotom malomocnému odpadne aj noha. Chytí ju a vyhodí von. A na to koktavý hovorí:\r\n- Zzzzzzdrháš?', 250, 3.53, 33),
	(7623, 'Šepká jeden galejník druhému pri veslovaní na galére uprostred Stredozemného mora:\r\n- Tunel? A kam?', 106, 3.02, 33),
	(7624, 'Pýta sa väzeň spoluväzňa:\r\n- Za čo sedíš?\r\n- Za peniaze.\r\n- Dokelu, a mne za to sedenie neplatia!', 105, 3.3, 33),
	(7625, 'Obžalovaný, chcete ešte niečo povedať pred vynesením rozsudku?\r\n-Áno, slávny súd. Chcem iba povedať, že už som bol trestaný 12 krát a aj tak to bolo zbytočné.', 174, 3.22, 33),
	(7626, 'Príde nováčik do basy a odchytí ho starý mukel a pýta sa ho:\r\n"Chceš to s krémom alebo bez?"\r\nNováčik sa zamyslí a hovorí, že radšej s krémom. A mukel na to kričí: "Krémo poď, dnes ideme dvaja..."', 215, 3.34, 33),
	(7627, 'Manželka väzňa mu hovorí: \r\n- Počuj Rudo, strážnik mi povedal, že sa už len 1989-krát vyspíš a ideš domov!', 119, 3.07, 33),
	(7628, 'Inšpektor sa pýta riaditeľa väznice:\r\n- Máte to tu zle zabezpečené a napriek tomu vám nikto neušiel. Čím to je?\r\n- Veľmi ľahké. Každý deň čítam väzňom oznámenia o zvyšovaní cien na Slovensku.', 215, 3.12, 33),
	(7629, 'V base:\r\n"Prajem ti všetko najlepšie do nového roku!"\r\n"Akýže nový rok? Veď je ešte len september."\r\n"Počul som, že ti ešte rok pridali."', 148, 3.32, 33),
	(7630, 'Pýta sa vezeň policajta:\r\n- Prečo tu máte mreže? Veď tu nie je čo kradnúť.', 83, 3.03, 33),
	(7631, 'Vo väzení si väzeň ťažko prekopáva tunel zo svojej cely. Po mesiacoch úmornej práce sa dostane k ďalšej stene. Zaklope na ňu a pýta sa: \r\n- Chceš mi pomôcť? Utečieme spolu.\r\n- Ja nemôžem - ozve sa hlas spoza steny.\r\n- Prečo?\r\n- Ja som dozorca.', 263, 3.02, 33),
	(7632, 'Dozorca v cele odsúdených na smrť:\r\n- Chlapi, až sa vás zajtra pred popravou budú pýtať na posledné prianie, želajte si niekto, aby mi zvýšili plat.', 160, 3.17, 33),
	(7633, 'Policajt zatvoril chlapa do cely bez záchodu. Tomu sa strašne chcelo srať, tak to švacol na noviny a noviny prilepil o plafón. Policajt ide okolo a hovorí si:\r\n- Chcelo sa mu ísť na záchod, ale ten tu nemá. Prečo sa tvári tak spokojne?\r\nZrazu zbadá hovno na plafóne.\r\n- Ty kokso! Kto vie, ako sa na tom plafóne pri sraní udržal?', 345, 3.15, 33),
	(7634, 'Sudca hovorí obžalovanému:\r\n- Ste obžalovaný, že ste riadili auto v podnapitom stave.\r\n- To nie je pravda, pán sudca. Bol som opitý práve tak, ako vy teraz.\r\n- Zapisovateľ, poznamenajte, že obžalovaný priznáva svoju vinu.', 235, 3.26, 33),
	(7635, '"Jeane, pohár vody, prosím." \n"Nech sa páči, pane." \n"Ďakujem, Jeane. Jeane, ďalší pohár vody, prosím." \n"Nech sa páči, pane." \n"Ďakujem, Jeane. Jeane,  ešte jeden pohár vody, prosím." \n"Nech sa páči, pane." \n"Ďakujem, Jeane. Jeane?"\n"Áno, pane."\n"Zavolaj hasičov. Toto sami neuhasíme."              ', 322, 3.5, 33),
	(7636, '"Kúpil som ti niečo na krk, drahá." hovorí Škót svojej žene.\r\n"Náhrdelník?" teší sa manželka.\r\n"Nie."\r\n"Zlatú retiazku?"\r\n"Nie."\r\n"A čo je to teda?" vyzvedá žena.\r\n"Mydlo, drahá!" vraví Škót.              ', 225, 3.57, 33),
	(7637, 'Traja lordi sa v klube rozprávajú o poslednom víkende. Lord Charles hovorí:\r\n"Ja som strávil celý víkend vo svojom letnom sídle s tromi sestrami."\r\n"Ach, to musela byť nuda." ľutujú ho priatelia.\r\n"Ani by som nepovedal. To neboli moje sestry." upresnil lord Charles.              ', 291, 4, 33),
	(7638, 'Lord Charles Norton ide okolo žobráka, hodí mu libru a vraví:\r\n”Daj si v najbližšej krčme whisky na moje zdravie.”\r\n”Ja som abstinent, pane.” odvetí žobrák.\r\n”Tak si kúp nejaký dobrý tabak.”\r\n”Ďakujem, pane, ale ja som nefajčiar.”\r\n”Tak v tom prípade tu máš 50 libier. Choď za nejakou ľahkou dievčinou a uži si.” navrhuje rozptýlenie lord.\r\n”Prepáčte, pane, ale ja netúžim po takých ženách.” skromne odpovedá žobrák.\r\n”Vieš čo, tu máš 100 libier! Zájdi za mojou ženou a povedz jej, nech sa pozrie, ako vyzerá chlap, ktorý nepije, nefajčí a nesúloží s ľahkými devami!”              ', 657, 3.93, 33),
	(7639, 'Lord sedí po večeri zamyslene pri stole. Sluha sa ho pýta: \r\n”Stalo sa vám niečo, pane?”\r\n”Áno. Naša slúžka otehotnela a ja neviem, či budem otcom, alebo dedom.”              ', 193, 3.8, 33),
	(7640, '”Povedzte, James, kto je tu blbec, vy či ja?”\r\n”Pán gróf... vy nie ste človek, ktorý by zamestnával blbca.”              ', 135, 4, 33),
	(7641, '”Mám kúpiť zeleného alebo červeného papagája, pane?”\r\n”Červeného, James, zelený je ešte nezrelý.”              ', 131, 3.63, 33),
	(7642, 'Stalin si zavolá generála a pýta sa, koľko má rokov. Generál odpovedá:\r\n”Práve zajtra budem mať šesťdesiat.”\r\nStalin sa usmeje a vraví:\r\n”Hm, nebudeš.”              ', 186, 3.92, 33),
	(7643, 'Sedia traja lordi na terase penziónu v kúpeľoch, pozerajú sa na promenádu a mlčia. Zrazu jeden z nich prehodí:\r\n- To bola vojvodkyňa z Ostermooru.\r\nTicho. Asi za štvrť hodiny povie druhý:\r\n- To nebola vojvodkyňa z Ostermooru.\r\nA zase ticho. Po ďalšej štvrťhodine povie tretí:\r\n- Predsa sa, páni, nebudete hádať.              ', 345, 3.63, 33),
	(7644, '- Jean, pamätáte sa, ako sme boli pred tridsiatimi rokmi v Afrike?\r\n- Ľutujem pane, ale to bol ešte môj predchodca.\r\n- Ale nie, Jean, to ste boli určite vy. Spomínate si predsa, ako vás tam potom zožral ten lev!              ', 234, 3.89, 33),
	(7645, '- Jean!\r\n- Áno, pane? Tu som, želáte si?\r\n- Silno treskni dverami!\r\n- A prečo, pane?\r\n- Nevypytuj sa, Jean, som strašne nahnevaný!\n', 137, 4.23, 33),
	(7646, 'Lord si zavolá Jeana a vraví mu: \r\n"Jean, chcel by som vykonať nejaký dobrý skutok, ale nič ma nenapadá. Čo by si mi poradil?"\r\nJean je veľmi prekvapený, chvíľu premýšľa a potom povie: \r\n"No, viete, pane, začína sa riadna zima, všetko zanedlho pokryje sneh, čo keby ste nasypali trochu zrna hladným vtáčikom na okennú rímsu vašej spálne?" \r\nLord sa zamyslí, rozžiaria sa mu oči a nadšene povie: \r\n"Jean, veď ty si génius! To by som potom tie vtáky mohol strieľať rovno z postele!"              ', 529, 4.15, 33),
	(7647, '"Jean, pohár vody, prosím."\r\n"Tu, pane."\r\n"Ďakujem. Jean, ďalší pohár vody."\r\n"Tu, pane."\r\n"Ďakujem. Jean?"\r\n"Áno, pane."\r\n"Zavolaj hasičov. Toto sami neuhasíme."\n', 174, 4.19, 33),
	(7648, 'Jedno rána po preflámovanej noci sa pýta lord svojho sluhu:\r\n"James, má náš záchod dvojkrídlové dvere?"\r\n"Nie, pane."\r\n"Tak potom som včera sedel v skrini."\n', 167, 4.05, 33),
	(7649, 'Raz sa lord vracia v nálade domov. Ľahne do postele a do\r\npohára vedľa postele dá svoje sklenené oko. V noci má však smäd,\r\nnahmatá pohár a hodí obsah do seba. \r\nRáno sa zobudí a niečo ho tlačí v dolnej časti tela. Zavolá sluhu, aby sa pozrel, čo tam má. Ten pozrie a hovorí:\r\n"Hrôza pane, niekto vám pozerá zo zadku!"\n', 344, 3.8, 33),
	(7650, 'Záplavy v Londýne. Voda sa valí predo dvermi lorda Paddingtona. Sluha James ich otvorí a povie:\r\n"Vaše lordstvo, Temža!"\n', 127, 2.32, 33),
	(7651, '"Jean, koľko je tu stupňov?"\r\n"Šestnásť, mylord."\r\n"Jean, a koľko stupňov je vonku?"\r\n"Štyri, mylord."\r\n"Tak otvor okná, nech je tu dvadsať!"\n', 152, 3.71, 33),
	(7652, 'Lord raňajkuje. Zrazu sa ozve veľký rachot a do salónu sa prebúra auto. Lord nehne ani brvou a pozve šoféra k stolu. Po výdatných raňajkách sa spýta:\r\n"Pane, kam vlastne máte namierené?"\r\nŠofér mu odpovie:\r\n"Do Liverpoolu."\r\n"To ste mal kratšie cez kuchyňu.\n', 276, 3.8, 33),
	(7653, '"Sir, prišiel list od starostu, píše, že chce cez bažinu za vašim\r\ndomom postaviť cestu. Mám poslať odmietavú odpoveď?"\r\n"Nie Jean, to by nepomohlo a trvalo by to dlho, než by sa celá záležitosť vyriešila. Napíšte mu, že súhlasím, ale musí si tu cestu prísť zajtra odkrokovať."\n', 304, 3.67, 33),
	(7654, '"Jean, kedy sme boli naposledy na love kačiek?"\r\n"Včera."\r\n"Tak prečo sme teda mali dnes zase koninu?"\r\n"Ľutujem, ale kuchár pripraví len to, čo ráčite trafiť."\n', 171, 4, 33),
	(7655, '"Povedzte Jean, zachoval som sa k vám niekedy sebecky?"\r\n"Nemôžem sa sťažovať, sir."\r\n"To som taký dobrák?"\r\n"Nie sir, ale nemôžem sa sťažovať, lebo nemám komu."\n', 176, 3.89, 33),
	(7656, '"Jean, kedy sme mali poslednú návštevu?"\r\n"To je už asi pätnásť rokov, sir."\r\n"A kto to bol?"\r\n"Ja sir, prišiel som sa spýtať, či je miesto komorníka stále volné."\n', 178, 4.13, 33),
	(7657, '"Jean, poslednou dobou sa mi nejako nepáčite, nie ste preťažený? Dám vám na niekoľko dní voľno."\r\n"Ďakujem sir, ale neprijmem váš návrh."\r\n"Prečo, Jean?"\r\n"Pretože keby som mal ja dávať voľno vám podľa toho, ako sa mi nepáčite, tak by som vás musel z tohoto domu vyraziť hneď prvý deň, čo som k vám nastúpil."\n', 341, 3.67, 33),
	(7658, '"Jean, pamätáte ako sme boli v Afrike?"\r\n"Sir to bol ešte môj predchodca."\r\n"Ale nie, Jean, bol ste to určite vy. Spomeňte si, ako vás tam potom zožral ten lev!"\n', 170, 3.67, 33),
	(7659, '"Jean, nachystajte mi guľovnicu, ideme na ryby."\r\n"Nebolo by lepšie vziať si udicu?"\r\n"Myslíte, že keď budem vyhrozovať rybárovi udicou, tak mi nejakú rybu dá?"\n', 171, 3.57, 33),
	(7660, '"Jean, prineste mi okno."\r\n"Prečo, pane?"\r\n"Chcem sa pozrieť do záhrady."\n', 77, 2.94, 33),
	(7661, '"Jean, má televízia dvierka?"\r\n"Nie, pane."\r\n"Tak to som sa zase díval celý večer do pece."\n', 97, 3.5, 33),
	(7662, '"Jean, ma citrón krídelká?"\r\n"Nie, pane."\r\n"Tak som si zase vymačkal do čaju kanárika."\n', 94, 3.6, 33),
	(7663, '"Jean, prineste mi klavír."\r\n"Prečo pane?"\r\n"Zabudol som si na ňom cigaru."\n', 79, 3.67, 33),
	(7664, '"Jean, bež zaliať trávnik!!"\r\n"Ale pane, veď prší!?"\r\n"Nevadí, vezmi si dáždnik!!"\n', 92, 4, 33),
	(7665, 'Hovorí Lord sediaci vo vlaku Jeanovi:\r\n"Jean, choďte napred a povedzte milosťpani, že hneď po vás prídem vlakom."\n', 121, 3.67, 33),
	(7666, 'Rozpráva starý lord svoje zážitky:\r\n"I-i-i-dem tak-k-to s-s-savanou a z-z-zrazu oproti mne t-tyger, t-t-tak... v-vytiahnem p-pušku a... a... p-posral som sa!"\r\n"Ale lord, to je pochopiteľné, v takej situácií by snáď každý..."\r\n"H-h-h-h-hlupáci, t-t-teraz som sa posral!"\n', 285, 4, 33),
	(7667, 'Rozhovor na golfovom ihrisku:\r\n"Zahráme si znovu budúcu sobotu?"\r\n"No, mal som mať v sobotu svadbu, ale môžeme to odložiť."\n', 131, 4.12, 33),
	(7668, 'Lord sa sprchuje a chce, aby mu Jean doniesol papuče. Jean to využije, ide do kuchyne za slúžkami a hovorí:\r\n"Lord chce, aby som vás hneď teraz pomiloval." \r\nSlúžky tomu nechcú veriť a chcú dôkaz. Jean ide pred kúpeľňu a pýta sa: \r\n"Obe pane?" \r\n"No áno, hádam nie len jednu."               ', 310, 4.1, 33),
	(7669, 'V londýnskom pánskom klube, po mnohých pohároch whisky, idú lordi Norton a Bushmills na pánske WC. Po vykonanej potrebe sa obaja vracajú naspäť do haly. Lord Norton ide rovno, no lord Bushmills si najprv umyje ruky. Neskôr, keď sedia pri tradičnej šálke čaju, vraví lord Bushmills lordovi Nortonovi:\r\n- Vaše lordstvo, nechcem nijako vyzdvihovať svoje vzdelanie, ale nás v Oxforde učili, že keď ideme od pisoáru, máme si umyť ruky.\r\n- Vaše lordstvo, odpovedá lord Norton, nás v Cambridge zase učili, ako si tie ruky neošťať.\n', 556, 3.89, 33),
	(7670, 'Sherlock Holmes a Watson sa vyberú stanovať. Strávia pekný večer pri ohníčku, postavia stan a idú si ľahnúť. Uprostred noci sa Sherlock Holmes prebudí, pozerá hore na nočnú oblohu a hovorí Watsonovi:\r\n- Drahý priateľ, čo vám hovorí nočná obloha?\r\nWatson sa zamyslí a povie:\r\n- No, môžu byť tak tri hodiny. Astronóm by povedal, že vo vesmíre je milión galaxií a miliardy hviezd. Z astrologického hľadiska by som povedal, že Saturn je v znamení Leva a meteorológ by povedal, že zajtra bude pekne. A čo hovorí obloha vám, drahý priateľ?\r\n- Watson, ste idiot, niekto nám ukradol stan.              ', 638, 4.15, 33),
	(7671, 'Viete prečo sa janko hraško nemože kupať? \r\nLebo by vyklíčil.              ', 81, 3.67, 33),
