	(7679, 'Je to oranžové, guľaté a začína to na P. \r\nČo je to?\r\nPomaranč.\r\nJe to oranžové, guľaté a začína to na N. \r\nČo je to?\r\nNeuveriteľné, zasa pomaranč!              ', 179, 4.17, 33),
