	(7681, 'Prechádza sa po ulici akýsi chlap a ťahá za sebou povraz. Zastaví ho jeden z chodcov:\r\n- Povedzte, prečo ťaháte za sebou ten povraz?\r\n- A čo ho mám tlačiť?              ', 181, 3.5, 33),
