	(7710, 'Vrazí muž do baru a zareve:\r\n- kto mi natrel koňa na zeleno?\r\nnikto sa neozýva tak to zopakuje a na tretí krát sa postaví chlap ako hora a hovorí:\r\n- ja som to bol, prečo?\r\nJemným hláskom odpovedá:\r\n- len som vám chcel povedať že už uschol a treba ho nalakovať ', 278, 3.56, 33),
