	(7714, 'V knižnici:\r\n-Prosím vás, kde máte nejaké knižky o samovraždách?\r\n-V strednom regáli, piaty rad zhora.\r\nO chvíľu:\r\n-Ale veď tu nič nie je!\r\n-No vidíte, akí sú ľudia. Požičajú si a nevrátia!', 210, 3.87, 33),
	(7715, 'Upratovačka sa vezie vo výťahu. Na druhom poschodí pristúpi slečna,n avonia sa silným parfumom a arogantne vyhlási:\r\n*Romance.Ralph Lauren,25 eur za mililiter."\r\nNa ďalšom poschodí nastúpi ďalšia slečna a tiež sa navonia parfumom. Vľúdne sa pozrie na obe ženy a vraví:\r\n*No.5.Chanel,50 eur za mililiter."\r\nUpratovačka vystupuje z výťahu, otočí sa,pozrie na mladé ženy, uľaví si a povie:\r\n*Brokolica. Lidl, 30 korún za kus."\r\n', 455, 3.69, 33),
	(7716, 'Jeden eskimák vraví druhému:\r\nPrichádza globálne otepľovanie. Musíme šetriť na mrazničku!"', 100, 3.44, 33),
	(7717, 'Svokra číta horoskop pre svoje znamenie na budúci týždeň.\r\nVšetci ma budú ospevovať, vynášať do neba a obsypávať kvetmi," hovorí povzneseným hlasom.\r\nNuž," dodáva zať, také už pohreby bývajú, mama... "', 224, 3.69, 33),
	(7718, 'Indián leží s uchom na vozovke a okolo neho plno turistov:\r\nIndián:- biely mercedes, automatická prevodovka, ABS...\r\nJeden z turistov, ktorý ho fotí, s úžasom hovorí:- To všetko viete, a to auto iba počujete?\r\nIndián odpovedá:- Nie, práve ma také zrazilo!', 271, 3.73, 33),
	(7719, 'Idu dve babky po lese a jedna vraví:my tri sme ale pekná štvorica', 68, 2.86, 33),
	(7720, 'Hluchý hovorí slepému:\r\n-,,Počuj nevidel si môj discman?"', 62, 3.41, 33),
	(7721, 'Mníška a mních putovali po púšti. Niekde v polovici cesty im zdochla ťava.\r\nZačali sa\r\nteda modliť, aby ich niekto našiel a zachránil. No modlitby nepomáhali a tak\r\nzačali rozmýšľať na blížiacim sa koncom. Mních vraví:\r\n- Vieš sestra, keď nás teraz naisto čaká smrť, mal by som jednu prosbu.\r\nVždy som si\r\nželal, aspoň raz v živote uvidieť nahé ženské telo. Mohli by ste sa vyzliecť\r\na nechať ma sa pozrieť?\r\n- Vieš brat môj, -vraví mníška -ja tiež som vlastne nikdy nevidela nahého\r\nmuža.\r\nMyslíte, že by ste sa tiež mohli vyzliecť?\r\nKeď stali oproti sebe nahí, mníška vraví:\r\n- Brat môj, čo je to ta malá vec, čo vám visí medzi nohami?\r\n- Sestra moja, to je dar od boha. Keď to do teba vložím, stvorí to nový\r\nživot.\r\n- Na mňa sa vykašli, brat môj! -navrhuje mníška -Strč to radšej do tej ťavy! ', 871, 3.83, 33),
	(7722, '- Chlapík tlačí na záchode ako najatý, ide okolo upratovačka, zdá sa jej,\r\nže sa zbytočne svieti, tak zhasne. V tom sa ozve strašný rev, tak zase\r\nzasvieti:\r\n- A čože tak revete?\r\n- Tfuj, to bol sprostý fór! Už som sa zľakol, že mi vypadli oči!', 263, 3.44, 33),
	(7723, 'Príde hosť do reštaurácie a pýta si palacinky s čokoládou. Po chvíli príde servírka, naservíruje mu palacinky.. hosť na ne pozrie a vidí, ako sa z nich sype granko. Zavolá na čašníčku, posťažuje sa a ona mu odvetí: "A vám sa to granko nerozpustilo?"', 271, 3.84, 33),
	(7724, 'Fero pozerá telku, príde za nim malý Ferko a pýta sa ho:\r\n- Ocko, aký je rozdiel medzi potencionálne a reálne?\r\n- Mhh ... - odvetí Fero - akoby som Ti to ... no choď sa spýtať\r\nmamy, či by sa za milión eur vyspala s Kevinom Costnerom, tvojej\r\nsestry či by sa za milión eur vyspala s Tomom Cruisom a tvojho brata\r\nči by sa za milión eur vyspal s Bradom Pittom.\r\nZa chvíľu sa malý vráti a referuje:\r\n- Mama povedala, že by sa s nim vyspala aj za menej, sestra že je to\r\njej sen a môj brat povedal, že za milión eur by dal aj Eltonovi\r\nJohnovi.\r\n- Tak vidíš, - dovysvetlí Fero - teraz to pochopíš. Potencionálne\r\nby sme sa stali milionármi a reálne mame doma dve kurvy a jedného\r\ntepľoša.', 722, 3.84, 33),
	(7725, '...idem na hríby... A čo tak zavčasu? Ale, chcem tam byť skôr než oni...', 78, 3.36, 33),
	(7726, 'Príde veľmi špinavý a smradľavý chlap do krčmy ...\r\n-Čavte, stavíme sa, že ma ľudia volajú boh?\r\n-Ale prosím ťa, no skús nám to dokázať.\r\nMuž ide k prvému domu na ulici a  zaklope na dvere. Otvorí mu staršia pani a vraví: "Bože, zase si tu?" ', 266, 4.08, 33),
	(7727, 'Ide retardovaný po lese a vidí hríb:\r\n"Aha, hríííbik."\r\nIde ho rozkopať a v tom mu hríbik hovorí: \r\n"Keď do mňa nekopneš, splním ti tri želania."\r\n"No, tak chcem byt normálny", a je normálny. "Ja sa z toho poseriem", a hovno spadlo na hríbik. "Ja debíííl."\r\n"...aha hríííííbik."', 303, 4.05, 33),
	(7728, 'Žena víta manžela: "Milan dnes máme výročie svadby, nepôjedeme do reštaurácie?"                       "Nemám oblek."                         "Požičala som ti od suseda."        "Nemám peniaze."                   "Nevadí, našetrila. Tak teda poďme."  Hneď ako prídu do reštaurácie, víta ich čašník: "Áááá, ahoj Milan!"         "Ticho som tu s manželkou."         Barman sa pýta: "Milan, teqilu ako vždy?"                         Sakra,ticho som tu s manželkou, chápeš?"      Na pódiu práve prebieha striptíz, striptérka si už odložila všetko a volá: "Tak pánove, kto z vás tu, je najlepší?" A všetci v reštaurácii odpovedia: "Miláááán!!!" Manželka vstane a odíde preč. Milan za ňou uteká, ona naskočí do taxíka a on za ňou. Manželka začne nadávať: "Myslela som si, že si normálny chlap, ale ty si taký blbec!" Taxikár sa pozerá a povie: "Teda Milan, na takú protivnú babu si ešte nenarazil."', 964, 3.86, 33),
	(7729, 'Idú dve kostry na motorke a jedna sa pýta druhej:Načo ti je zo sebou ten náhrobný kameň? \r\nA druhá odpovedá: Bez dokladov nikam nejdem!', 143, 3.94, 33),
	(7730, 'Pesimista vidí tmu.\r\nOptimista vidí svetlo.\r\nRealista vidí vlak.\r\nRušňovodič vidí 3 debilov na koľalniciach!', 116, 4.03, 33),
