	(7733, 'Archimedes Pascal a Newton hrajú skrývačku. Archimedes žmúri. Newton nakreslí štvorec /meter krát meter/ a postaví sa doňho. Archimedes dožmúri a zbadá Newtona v štvorci. Archimedes povie: "Newton, našiel som ťa, zmúriš" A Newton mu nato: "Nie, newton na meter štvorcový je pascal."\r\n', 304, 2.92, 33),
	(7734, 'Janko a Marienka sa hrajú v piesku a zrazu Janko siahne Marienke pod sukňu a začudovane sa pýta Marienky: "Marienka ty si chlapček??" Marienka mu na to: "Nie, ja kakám!!!"', 177, 3.86, 33),
	(7735, 'Pýta sa Rus Rusinky: "Zdrastvite Nataša Ivanovňa, ako ste sa vy úspešná profesorka stala prostitútkou?" \r\nRusinka odpovedá: "Ehm, ani sama neznám, prosto šťastie."', 174, 3.71, 33),
	(7736, 'Poštár zazvoní pri dverách. Otvorí mu chlapec s pivom v ruke a cigaretou v ústach. Poštár sa ho pýta: "Sú rodičia doma?"  Chlapec si potiahne z cigarety, pozrie na poštára a povie: "Čo myslíš?"\r\n', 211, 3.7, 33),
	(7737, 'Otázka: Čo by sa stalo, keby sa zem točila 30-krát rýchlejšie? Odpoveď: Muži by mali každý deň výplatu a ženy by vykrvácali.', 138, 3.47, 33),
	(7738, 'Dve bosorky idú po cintoríne, a v tom vybuchne bomba. Jednej roztrhalo ústaod ucha k uchu a druhá jej vraví: "Čo sa smeješ, veď nás to mohlo aj zabiť!"', 161, 3.66, 33),
	(7739, 'Francúz, Angličan a Slovák sú v pralese, chytia ich ľudožrúti a povedia im: "Zabijeme vás a urobíme si z vás kanoe, ale môžete si vybrať druh smrti."\r\nAngličan si vyberie pištoľ, a predtým ako si strelí do hlavy povie: "Boh ochraňuj kráľovnú, a potom sa zastrelí."\r\nFrancúz si vyberie kord, a predtým ako sa prebodne povie: "Selaví a prebodne sa."\r\nSlovák si vyberie vidličku a celý sa začne pichať. Je to strašný pohľad a keď je už celý dopichaný, tesne pred tým ako poslednýkrát vydýchne, iba potichu povie: "A máte po kanoe."', 571, 4.04, 33),
