	(7742, 'Policajt zastaví na diaľnici mercedes. Nazrie dnu, za volantom doga!\r\n- Vy ste blázon! Pustiť psa za volant!\r\n- Ale keď on nechcel pustiť mňa!', 149, 3.23, 33),
