	(7755, 'Viete aký je rozdiel medzi motorovou pílou a záchodovým papierom?\r\nŽiadny. Stačí malý nepatrný pohyb a prst máš v riti.', 130, 3.83, 33),
	(7756, 'Išli dvaja chlapci po lese. Jeden videl len na jedno oko a druhý nevidel vôbec. Ten čo videl len na jedno oko, si ho v lese vypichol a hovorí: "A sme došli!"A ten druhý mu odpovie: "Ahoj baby."', 200, 2.55, 33),
	(7757, 'Stretne sa krokodíl s chobotnicou a krokodíl jej hovorí: "Počúvaj, chcem ťa zožrať." A chobotnica na to: "No a čo, ja mám doma gitaru."', 145, 2.52, 33),
	(7758, 'Peťkov ocko pošle Peťka do lekárne kúpiť viagru.\r\nLekárnička mu vraví:\r\n- Odkáž ockovi, nech si dá jednu tabletku za 24 hodín!\r\nPríde peťko domov a hovorí:\r\n- Ocko máš si dať 24 tabletiek za jeden deň!\r\nPo čase príde Peťko znovu do lekárne...\r\n- No čo, Peťko, ako???\r\n- Ale, mamina umrela, sestra je tehotná a mňa bolí zadok...', 356, 3.57, 33),
	(7759, 'Pani sa pýta psychiatra: "Môj manžel vypije kávu, zje hrnček a uško nechá. Nie je to divné?""To áno, ja mám uško najradšej."', 136, 4.16, 33),
	(7760, 'Ide Američan po Sahare a stretne jazdca na ťave. Jazdec na ťave sa ho pýta:- Čo tu robíš s tou pílkou? Veď tu žiadne stromy nie sú.Američan mu na to odpovie: - Ale boli!', 181, 3.52, 33),
	(7761, 'Dvaja turisti v New Yorku idú do hotela mrakodrapu. Jeden z nich je koktavý. Keď prídu k výťahom, zistia, že nefungujú. Naštvaní sa rozhodnú ísť pešo. Idú, idú a koktavý hovorí:\r\nKu ku ku ku..A ten druhý ho napomenie: Nenadávaj, vydrž, čochvíľa sme hore. Ale koktavý znova: Ku ku ku ku... Už sú na 20 poschodí celí vysilení a koktavý konečne povie, čo chcel: \r\nKu ku kufre sme si zabudli pri výťahu.  ', 436, 3.85, 33),
	(7762, '- Viete ako sa skloňuje prídavné meno malý?- Malý, menší, to čo je?\r\n', 77, 4.06, 33),
	(7763, 'Chuck Norris vie niekomu odtrhnúť hlavu a hodiť mu ju do ksichtu.\r\nChuck Norris vyhral preteky na stacionárnom bicykli.\r\nChuck Norris je častým darcom krvi, pravdaže nie svojej.\r\nPoznáš mŕtve more?Nie?  To Chuck Norris ho zabil!\r\nChuck Norris zomrel pred 10 rokmi, ale smrtka nemala odvahu mu to povedať.\r\nAk Chuck Norris spadne do vody nebude mokrý, ale voda sa OchuskNorrisuje.\r\nAk Chuck Norris mešká, mal by čas spomaliť. To mu radím.\r\nChuck Norrys je taký rýchly, že dokáže obehnúť zem a buchnúť si do chrbta      .              \r\n                                                      ', 615, 3.63, 33),
	(7764, 'Ide beznohý a holohlavý na motorke.A holohlavý vraví beznohému: "Dupni na to fáro, až mi odveje moje háro.ô', 116, 3.68, 33),
	(7765, 'Mala loď nabúrala do veľkej ruskej lode. Rusky kapitán vytiahol stroskotancov na palubu a hovorí kapitánovi malej lode:\r\n- Pačimu ty najebál do majevó karabľá?\r\nKapitán pokrčí plecami.\r\n- Sprechen Sie Deutsch?\r\nKapitán nereaguje.\r\n- Parlez vous francais?\r\nKapitán nereaguje.\r\n- Do you speak English?\r\n- Yes Sir !!!\r\n- Yes? Tak pačimu ty najebál do majevó karabľá?', 384, 4.22, 33),
	(7766, 'Na diskotéke sa jednému chlapíkovi zapáči dievča. Riadna kosť. Tak sa odhodlá ísť za ňou a chce sa jej prihovoriť, ale v tom dievča odíde na WC. Chlapík celý nažhavený čaká pred WC a rozmýšľa, čo jej povie. Vtom dievča vyjde a chlapík celý bez seba vypustí:\r\n- Čau, srala si?', 304, 3.53, 33),
	(7767, 'Po rokoch stretne Fero Jana a vidí, že on viditeľne schudol, a kedže aj on by chcel tak schudnúť, tak sa ho pýta, ako to dokázal. On mu dá adresu jednej firmy a on tam na druhý deň zájde. Tam ho zavrú do miestnosti a po chvíli vojde žena, vyzlečie sa a hovorí:\r\n- Ak má chytíš, tak má môžeš pretiahnuť.\r\nNaháňa ju tri hodiny, ale nechytí ju. Príde domov, postaví sa na váhu a fakt schudol 5 kíl. Na druhý deň vojde do tej istej miestnosti, poukladá všetky veci tak, aby ju mohol chytiť a čaká. Zrazu sa otvoria dvere, vojde svalnatý černoch a hovorí:\r\n- Ak ťa chytím, tak ťa pretiahnem.', 631, 4.2, 33),
	(7768, 'Príde trpaslík na čerpaciu stanicu a vraví pumpárovi:\r\n"Prosím si dve kvapky benzínu a jednu kvapku oleja."\r\nPumpár sa naňho pozrie:\r\n"A prdnúť do pneumatiky by si nechcel?"', 184, 4, 33),
	(7769, 'Traja muži prídu do neba a svätý Peter sa ich pýta ako zomreli.Prvý hovorí: "Prišiel som domov a na posteli ležala moja žena nahá. Pozrel som von oknom a na parapete som zbadal, že sa niekto drží. Zobral som kladivo a treskol som mu po rukách. Padol dole, ale bola tam posteľ, tak som chytil chladničku a vyhodil ju naňho, a keď som sa vracal naspäť k žene, tak som sa napichol na kladivo a zomrel som."A ty, ako si zomrel?" - pýta sa druhého.On odpovedá: "Vypadol som z okna, zachytil som sa o poschodie nižšie, ale niekto mi buchol kladivom po prstoch, tak som spadol dole. Našťastie tam bola posteľ. Lenže potom na mňa vyhodil chladničku a zomrel som.A pýta sa tretieho: "Ty, ako si zomrel?"A on hovorí: "Ja si sedím nahý v chladničke a niekto ma zrazu vyhodil von oknom."', 813, 3.86, 33),
	(7770, 'Viete prečo sa nevolal Hitler zel?Lebo, ako by to vyzeralo keby hovorili hayzel', 80, 2.89, 33),
