	(7779, 'Nesie sluha kráľovi polievku, vojde do izby podá kráľovi polievku a kráľ sa ho pýta:"Prečo máš prst v mojej polievke?""Lebo som bol u doktora a povedal mi, že si ho mám držať v teplom.""A prečo si ho nedržíš v zadku?""Tam som si ho držal predtým ako som vám doniesol polievku."', 299, 3.12, 33),
	(7780, 'Otázka: Na čo myslíme, keď ráno vstávame do školy?\r\nOdpoveď: Slnko stoj, slnko nevychádzaj chcem byť s ňou, s mojou jedinou poduškou...\r\n\nOtázka: Na čo myslíme už v pondelok?\r\nOdpovedď: V piatok podvečer si zresetujem hlavu...\r\n\nOtázka: Aké sú naše pocity pred písomkou?\r\nOdpoveď: Nedá sa ujsť, pred testom neutečieš...\r\n\nOtázka: Čo si myslí triedna, keď vchádza do triedy a nesie písomky so samými 5?\r\nOdpoveď: Teď kráľovnou sem já...\r\n\nOtázka: A na našu desiatu ?\r\nOdpoveď: Mám na teba chuť, stále ťa chcem, kúsok po kúsku, celú ťa zjem...\r\n\nOtázka: Čo mi povie otec keď nezmaturujem?\r\nOdpoveď: Ulica je krásny dom, vstúpte doň...\r\n\nOtázka: Ako si naši rodičia predstavujú našu budúcnosť?\r\nOdpoveď: Promovaní inžinýři...\r\n\nOtázka: A čo my na to?\r\nOdpoveď: Kým vieš snívať tak máš nádej...\r\n\nOtázka: Čo nastane po prázdninách keď musíme ísť do školy ??\r\nOdpoveď: Keď ťa v noci budia, strašidelné sny ...\r\n\nOtázka: Čo odpovieme spolužiačke/ovi keď sa nás spýta, či ideme s ním za školu?\r\nOdpoveď: So mnou vždy môžeš rátať...:)', 1137, 3.91, 33),
	(7781, 'Nový farár bol pri svojej prvej kázni tak nervózny, že takmer ani\r\nnedokázal prehovoriť. Ďalšiu nedeľu, pred druhou kázňou, sa\r\nspýtal prítomného arcibiskupa, že čo by mal urobiť, aby sa uvoľnil. Ten mu\r\nporadil: "Kvapnite si do vody trochu vodky, uvidíte, že po\r\nniekoľkých hltoch budete trochu kľudnejší."\r\nFarár poslúchol radu a skutočne, cítil sa tak výborne, že by dokázal\r\nrečniť aj vo víchrici, úplne kľudne. Po bohoslužbe sa vrátil do sakristie, kde našiel lístok od arcibiskupa, ktorý mu odkazoval:\r\nVážený Otče:\r\n\nNabudúce si nalejte vodku do vody, nie vodu do vodky. V ďalšom pripájam niekoľko poznámok, aby sa už neopakovalo to, čo som videl na dnešnej omši:\r\n- Na okraj kalicha nie je nutné dávať koliesko citróna.\r\n- Tie kabínky v bočnej lodi sú spovednice, nie toalety.\r\n- Snažte sa neopierať o obraz Panny Márie, a už vôbec ju nemusíte objímať a bozkávať.\r\n- Máme 10 prikázaní, nie 12.\r\n- Apoštolov bolo 12, nie 7, a žiadny z nich nebol trpaslík.\r\n- Nášho Pána Ježiša Krista a Jeho Apoštolov nenazývame "JC & His Boys".\r\n- Dávid porazil Goliáša prakom a kameňom, nie je pravda, že by ho "dojebal".\r\n- Judáša neoznačujeme za "zkurveného zmrda".\r\n- Svätého Otca sa nepatrí prezývať "Papa Ratzi".\r\n- Bin Ládin nemal nič dočinenia s Ježíšovou smrťou.\r\n- Svätená voda je na požehnanie, nie na osviežovanie zátylku.\r\n- Nikdy sa nemodlite sediac na schodíkoch pred oltárom.\r\n- Hostie sa majú rozdať veriacim, nemajú sa prikusávať k vínu.\r\n- Veriaci hádžu príspevky do pokladničky dobrovoľne; odstráňte nápis: "Vaše sprepitné je môj plat".\r\n- Hriešnici pôjdu do pekla, nie "do piče".\r\n- Pri otčenáši je možné dvíhať ruky k nebesiam, ale nie sa kývať do vlny.\r\n- Vašu iniciatívu, aby si všetci prítomní zatancovali, hodnotím kladne,\r\nale robiť vláčik po celom kostole, to NIE!\r\nDôLEŽITé: Ten, čo sedel v kúte pri oltári, a o ktorom ste tvrdili, že to je "buzík v sukni" a "transvestita bez make-upu", to som bol ja.\r\nDúfam, že do budúcej nedele tieto nedostatky napravíte. Inak, na prvú\r\nkázeň to bolo celkom dobré.\r\nS pozdravom,\r\n\nArcibiskup', 2218, 4.26, 33),
	(7782, 'Z fary odišiel starý kaplán do dôchodku a na jeho miesto prišiel nový, mladý, neskúsený kňaz. Pri spovedi jednej mladej dámy, ktorá sa spovedala z oreálneho sexu, si nevedel rady. Preto si zavolal na pomoc miništranta a pýta sa ho: "Čo dával starý kaplán za orálny sex?"\r\nChlapec chvíľu rozmýšľa, a potom odpovie: "Ako komu, mne fidorku..."', 365, 4.16, 33),
	(7783, '- Prečo chodí smrtka s kosou? - Lebo neurobila vodičák na kombajn.', 70, 3.79, 33),
	(7784, 'Môžeš mi rozopnúť košelu, môžeš mi dať dole gate, môžeš ma vyzliecť úplne celú.\r\nZnačka: Tvoja BabyBorn.', 121, 3.05, 33),
	(7785, 'Daj mi dole tričko, daj mi dole nohavice, daj mi dole spodné prádlo a môžeš aj podprsenku, ale štipce na šnúre nechaj.', 127, 3.67, 33),
	(7786, 'Príde chlap do baru, kde obsluhuje barman robot. Ten mu natočí perfektné pivo a spýta sa ho, aké má IQ. \r\nChlapík odpovedá, že niekde okolo 150. \r\nBarman sa s ním začne baviť o kvantovej fyzike, globálnom otepľovaní, makroekonómii, nanotechnológiach…\r\nChlap je z toho celý mimo, tak si povie, že ho vyskúša. Ide domov, prezlečie sa a vráti sa do baru. Barman mu opať natočí perfektné pivo a spýta sa ho, aké má IQ. \r\nChlapík odpovie, že okolo stovky.\r\nRobot s ním začne kecať o futbale, ženských a autách…\r\nChlapovi sa to hrozne zapáči, tak ide ešte domov, prezlečie sa a vráti sa do baru.\r\nObdrží opäť perfektné pivo a zvyčajnú otázku na IQ.\r\nTentokrát povie robotovi, že má IQ 50.\r\nNa to se barman nakloní až k nemu a pomaly, ale skutočne pomaly sa ho spýta:\r\nTak čo? Zase budeme voliť Fica? \r\n', 861, 3.7, 33),
	(7787, 'Idú dvaja transformeri z diskotéky a jeden sa pýta druhého: "Počuj, nezložíme sa na taxík?" ', 100, 3.04, 33),
	(7788, 'Poľovnik prichytil v lese chlapa s autom a v jeho kufri našiel jeleňa. Oboril sa na neho:\r\nČo to má znamenať?\r\nNič. To je môj pes!\r\nA čo tie parohy?\r\nNeviem, to je jeho problém!', 187, 3.52, 33),
	(7789, '- "Čo máte v tom kufri?"- "A čo ja viem...?"- "Jáááj, tak pán je zo Slovenska."', 86, 3.51, 33),
	(7790, 'Ide farár na aute po diaľnici a v diaľke zbadá bilboard, na ktorom vidí Ukrižovaného Ježiša a nad ním nápis „Naše Klince udržia Všetko“\r\nFarár sa zhrozí a rýchlo ide za firmou, ktorá bilboard spravila. Ide k riaditeľovi firmy a hovorí mu: „Pane, takéto reklamy nemôžete robiť, je to proti kresťanstvu, je to neslýchané...“ Riaditeľ ho teda ubezpečí, že reklamu zmení. \r\nO týždeň na to ide farár opäť tou istou cestou, aby skontroloval bilboard. Ale čo nevidí, teraz je na bilboarde zobrazený Kríž, pod krížom leží Ježiš tvárou v blate a nad ním je nápis „Vidíte, toto by sa nestalo kebyže používate naše Klince...“\r\n', 685, 4.03, 33),
	(7791, 'Ide slon po ceste a stúpi do mraveniska. Slon sa strasie, ale jeden mravec mu ostane na krku. Mravec na krku sa pýta ostatných mravcov dole: "Čo mám robiť" A zdola naňho kričia: "Zaškrť ho!! Zaškrť ho!!', 214, 4.02, 33),
	(7792, 'Dva mravce chytia slona a jeden hovorí druhému: „Ty podrž slona a ja skočím pre horčicu.“ Vráti sa s horčicou a pýta sa mrava: „Kde je slon?“ Mravec mu odpovedá: „Ušiel." "Neklam, ešte prežúvaš.“', 222, 4.03, 33),
	(7793, 'Pesimista je len dobre informovaný optimista.', 46, 3.34, 33),
	(7794, '18-ročný chlapec sa pýta otca čo mu spraví, keď príde domov opitý. Otec mu sľúbi, že sa ho ani nedotkne. A tak sa chlapec ide opiť. Ráno sa zobudí celý dobitý a pýta sa otca: " Oci, ty si ma včera zbil?" Otec odpovedá: "hej"..."ale prečo ved si mi sľúbil že mi nič nespravíš" a tak otec hovorí: "No vieš synak, hneď vo dverách si poslal mamičku do p..i - to by mi nevadilo. Potom si pretiahol vlastnú sestru - to by mi tiež nevadilo. Ale keď si prišiel do obývačky, vysral si sa pred telku, napichal si do hovna špáratká a povedal si odteraz tento ježko býva s nami, tak to ma už nasralo".  ', 634, 4.24, 33),
	(7795, 'Stretne sa malý ušný maz, malý zubný kaz a malá vaginálna blcha.\r\nMalý ušný maz sa sťažuje: „Viete aké je to ťažké, keď raz do dňa sa treba schovať pred vatovou tyčinkou? To je niečo!“\r\nMalý zubný kaz vraví: „Ale prosím ťa, to nič nie je! Viete aké je to ťažké dva razy do dňa čiže ráno a večer sa schovať pred zubnou kefkou? To je niečo!“\r\nMalá vaginálna blcha kývne rukou a vraví: „Ale prosím Vás, viete, aké je to ťažké, keď sa musíte trikrát do dňa, čiže ráno, na obed a večer, skrývať pred nejaký totálnym idiotom, ktorý ani nevie, či má ísť dnu alebo von a nakoniec mi domček oserie takým bielym hnusným sajrajtom? To je niečo!“\r\nA Malý zubný kaz vraví: „Toho hajzla poznám!“\r\n', 772, 2.25, 33),
	(7796, 'Ide babka po pláži a zakopne o predlžovačku.', 48, 2.73, 33),
	(7797, 'Aladin tri dni a tri noci šúchal lampu až kým nevyšúchal "Made in China"', 78, 2.34, 33),
	(7798, 'Stretnú sa Slovák, Maďar a Čech.\r\nČech hovorí: My máme toľko zbraní, že vás všetkých postrieľame.\r\nMaďar hovorí: My máme toľko tankov, že vás všetkých rozbúrame.\r\nA Slovák hovorí: A my zas máme toľko cigáňov, že vám to všetko ukradnú.\r\n', 269, 4.28, 33),
