	(7805, 'Schwarzenegger to ma dlhe, Klinton to ma kratsie,  Bush to ma kratke, Madonna to nema a Papey to nepouziva. Čo je to??? Priezvisko.', 132, 3.88, 33),
	(7806, 'Stretnú sa vlk, medveď a prasa v krčme a začnú sa vychvaľovať ako sa ich kto bojí.\r\nPrvý začne vlk: "Keď ja zavyjem, tak sa trasie celý les."\r\nDruhý ide medveď: "Keď ja zaručím, tak sa trasie celá hora."\r\nPrasa v pokoji sedí. Odpije si z drinku a povie: "Keď si ja trocha odkašlem, trasie sa celý svet od strachu."', 336, 2.04, 33),
	(7807, 'Otec leží na smrteľnej posteli a vraví svojim deťom: "Viete deti, keď som bol mladší  mal som peniaze, autá, ženy ... ale raz prišiel môj kamarát a povedal, že sa mám usadiť, mám mať rodinu a deti, lebo na smrteľnej posteli mi nebude mať kto ani pohár vody podať. A viete čo je najhoršie??? ... Že ja vôbec nie som smädný ... "', 355, 4.2, 33),
	(7808, 'Pani učiteľka chémie sa pýta Jožka: "Jožko čo sa vyparí rýchlejšie ako voda?" \r\nJožko najskôr pozerá do blba, ale potom sa silno zamyslí a hlasno vykríkne: "PENIAZÉÉ!!" ', 186, 4.15, 33),
	(7809, 'Idú dvaja hypnotizéri do hostinca a jeden hovorí druhému:\r\n“Ja zhypnotizujem tú barmanku tak, že odídeme bez platenia.“ Ako povedal, tak sa stalo. Idú po ulici a ten druhý hovorí:\r\n“Ja zhypnotizujem prvého okoloidúceho tak, že pustí na zem peňaženku.“ Ako povedal, tak sa aj stalo.\r\nIdú ďalej a ten prvý zase hovorí: „Na treťom poschodí býva muž. Ja ho zhypnotizujem tak, že za 10 sekúnd bude z jeho obývačky letieť televízor.“ \r\nČakajú minútu, čakajú dve a ten prvý hovorí: “Musím sa viac sustrediť.“ \r\nČakajú tri minúty, čakajú hodinu a zrazu ten muž vyjde na balkón a kričí im: NO NEMÁM! NO NEMÁM!\r\n', 668, 4.14, 33),
	(7810, 'Do holičského salónu vojde mladík s dlhými mastnými vlasmi. Holič sa ho pýta:\r- Budeme aj strihať alebo len vymeníme olej?', 132, 4.26, 33),
	(7811, 'Chuck Norris vie z USB spravit USA.', 35, 3.93, 33),
	(7812, 'Pristanú Američania na mesiaci a hovoria:\r- HUSTON, HUSTON, na mesiaci sú Rusi a natierajú ho na červeno.\rHUSTON odpovedá:\r- To nie je možné, máte halucinácie.\rNa druhý deň zasa:\r- HUSTON, HUSTON, Rusi natreli už skoro celý mesiac na červeno.\rZrazu uvidia, že je už mesiac celý červený a HUSTON odpovedá:\r- APOLLO, APOLLO, otvorte skrinku 182, tam je štetka a vápno. A na mesiac natrite COCA-COLA.', 420, 4.24, 33),
	(7813, 'Viete ako sa povie impotent po indiánsky?\r\n???\r\nMlčiace péro.', 64, 4.13, 33),
	(7814, 'Tri klamstvá Slovenského Národa: \r\n1. Idem na Jedno\r\n2. Dopijem a Idem\r\n3. Zajtra Nepijem', 92, 4.24, 33),
	(7815, 'Zazvoní smrtka pri dveroch a hutorí:\r\n-Dobri dzeň, odčitane ľudu.\r\n', 72, 3.96, 33),
	(7816, 'Čo je to panna?\r\nŠkaredá siedmačka.', 39, 3.33, 33),
	(7817, 'Ide vajce po púšti a zrazu je z neho volské oko.', 51, 3.25, 33),
	(7818, 'Otočíš se pro džus a kamarád ti bleskurychle sežere oblíbený koláč: \r\na. Dáš mu na zapití svůj džus a raduješ se, jak mu chutná. \r\nb. Vrazíš mu prst do krku a vyvoláš zvracení. \r\nc. Smutně posbíráš drobky a odejdeš spát.', 248, 2.58, 33),
	(7819, 'Keď ho vyberiem z toho pevného obalu je obrovský a na prvý pohľad veľmi tvrdý. Nežne ho uchopím a lížem z dola-hore.\r\nNa vrchole sa zastavím a jemne sa zahryznem. Je to on... predsa môj Magnum', 205, 4.1, 33),
	(7820, 'Rozprávajú sa traja lenivci:\r- Chlapi, horí nám dom.\r- Veď nás vynesú.\r- Že sa vám o tom chce hovoriť.', 112, 4.03, 33),
	(7821, 'Išiel Jano ráno z hodov, bielou cestou kráčal domov.\r\nHodina už siedma bola, ľudia išli do kostola.\r\nJano pokojne si kráča, zahryzuje do koláča.\r\nSem-tam glgne za hlt vína, čo mu dala jeho stryná.\r\nJano stále stretá ľudí, čosi sa mu v bruchu budí.\r\nTrikrát prdne a to stačí, že sa naňho hnačka tlačí.\r\nLenže ľudí plná cesta, hovno v riti nemá miesta.\r\nAni kríčka, ani stromov, trebalo by zájsť si domov.\r\nPrdol ešte zo tri razy, to sú predposledné fázy.\r\nJano v behu vpred sa derie, len-len, že sa neposerie.\r\nHlava mu od strachu puká, hovno mu do gatí kuká.\r\nUž je zle, hej veru áno, čo som sa nevysral ráno?\r\nTeraz utekať ho súri, sračka v riti mu už zúri.\r\nV behu odopína remeň, odpadne mu gombík jeden.\r\nUž je celkom blízko hajzla, v tom do gatí sračka švajzla.\r\nJano ako skala stojí, pohyb urobiť sa bojí.\r\nUž je celkom bez nádeje, sračka sa po lýtkach leje.\r\nBlízko hajzla stojí smutne, vtom zareve preukrutne \r\nmocným hlasom do vetra: "Chýbalo len pol metra!"', 1039, 4.15, 33),
	(7822, 'Idú traja upíri do baru a jeden hovorí:\r\n"Prosím si ľadovú krv."\r\nDruhý hovorí: "Prosím si horúcu krv."\r\nTretí hovorí: "Prosím si horúru vodu."\r\nTí dvaja naňho nechápavo pozerajú. Tretí uprí vytiahne z vrecka tampónik a hovorí: "Spravím si čajíček."', 275, 4.17, 33),
	(7823, 'Rozpráva sa ťava zo slonom:\r\nSlon: Ťava, prečo nosíš prsia na chrbte? \r\nŤava: Lepšie ako kok*t medzi očami.', 116, 4.24, 33),
	(7824, 'Nemec, Cigáň a Slovák sú v lietadle, ale zistia, že sú príliž ťažkí, a tak musia niečo vyhodiť.\r\nPrvý ide Nemec, vyhodí všetky 100-eurovky a povie: "Tých máme doma veľa."\r\nPo ňom ide Cigáň, vyhodí všetky vši a povie: "Tých máme doma veľa."\r\nNakoniec ide Slovák a Cigáň hovorí: "Na to ani nepomysli!"', 331, 4.23, 33),
	(7825, 'Aký je rozdiel medzi toaletným papierom a pílou?\r\nŽiadny, stačí chvíľka nepozornosti a prsty sú v riti.', 112, 4.16, 33),
	(7826, 'Išel Bieber do světa\r\nZasáhla ho raketa\r\nUtrhla mu pindíčka\r\nStala se z něj holčička\r\nJustin jenom valí oči\r\nTeplouš na něj z křoví skočí\r\nJustin to chtěl zkusit pusou\r\nA za chvíli šoustá s husou\r\nCo to za zvuk se k nám nese?\r\nTo Bíbra někdo šuká v lese\r\nJustin si jen zavzdychá\r\nKdy si zase zapíchá ', 328, 3.98, 33),
	(7827, 'Cigáň: "Dežo zahreš."\r\nDežo: "Robota..."', 45, 4.17, 33),
	(7828, 'Dežo dostal z poisťovne 000 Sk, lebo si vypichol oko. Stojí teraz pred poisťovňou a hovorí si: Vypichnem si aj to druhé a budem mať na farebný televízor. ', 164, 3.12, 33),
	(7829, 'Dvaja astronauti na mesiaci. Vydesené pohľady, chvíľa ticha... Zrazu sa jeden otočí k tomu druhému a hovorí: "No nedívaj sa tak na mňa. Ja som nezamykal!"', 164, 3.33, 33),
	(7830, 'FACEBOOK STATUS:\r\nEdward Cullen sa nudí.\r\nKomentáre:\r\nJasper: Kde je Bella?\r\nEdward Cullen: Má menštruáciu.\r\nBella: Nemusíš to každému hovoriť!!!\r\nEdward Cullen: Prečo? Veď máš...\r\nBella: Ani ja som nepovedala celému svetu, že svietiš na slnku ako svetluška, že si extrémne múdry a ani, že si rýchly!!! Ty niesi skutočný upír, ty si len EMO so svietiacím iskrivom!!!!\r\n\nBella si zmenila stav z relationship na single.\r\n- Použivateľovi Jacob sa to páči. ', 484, 3.89, 33),
	(7831, 'Bavia sa dvaja informatici.\r\nI: Ty máš nový notebook?\r\nII: Áno a zadarmo.\r\nI: Ako to?\r\nII: Bol som u kamarátky a ten notebook jej nefungoval. Tak som sa s tým páral asi 4 hodiny, ale nakoniec som ho opravil. A ona si sadla na stôl, vyzliekla si nohavičky a povedala: "Za to si môžeš zobrať, čo chceš".\r\nTak som si vzal ten notebook.\r\nI: Dobre si urobil. Veď v tých nohavičkách by si vyzeral ako buzerant...', 425, 4.16, 33),
	(7832, 'Keď ide malé dieťa spať, pozrie sa pod posteľ či tam nie je bubák. \r\nKeď ide spať bubák, pozerá či tam nie je Chuck Norris.', 135, 2.53, 33),
	(7833, 'Opri sa o mňa, \r\nbude ti dobre.\r\nSvet bude krásny\r\na nebo modré.....\r\nSpieva spevák na koncerte a fanúšik spieva s ním:\r\nOpri sa o mňa, \r\nja sa ti uhnem.\r\nTy na zem spadneš\r\na k tomu ťa kopnem.', 203, 3.83, 33),
	(7834, 'Mladý a starý zamestnanec idú spolu do práce. Mladý - notebook, 3 mobily, iPod, 3 čipové karty na krku, kufrík plný DVD, CD, USB atď. \r\nStarý - uvoľnený, len s igelitkou s jablkom a jogurtom. \r\nMladý hovorí s obdivom: "Teda, po toľkých rokoch práce to máte všetko v hlave, že?" \r\n"Nie, pán kolega, v pi*či, v pi*či to mám."', 348, 4.17, 33),
	(7835, 'Optimista vidí na konci tunela svetlo.\r\nPesimista vidí na konci tunela tmu.\r\nRealista vidí na konci tunela vlak.\r\nA rušňovodič vidí troch debilov na koľajniciach.', 170, 4.25, 33),
	(7836, 'Jedného dňa sa dostane do pekla cukrár, kováč a krajčír. Lucifer im hovorí: "Chlapi,  každý z vás dostanete 1 úlohu a ak ju splníte, budete prepustení."\r\nAko prvý ide do miestnosti kováč. Z miestnosti počuť strašný krik a rev. Keď vyjde von, ostatní dvaja sa ho pýtajú, čo mu tam robili, keď tak strašne kričal. Kováč hovorí: "Topánku mi na nohu prišívali."\r\nAko druhý ide do miestnosti krajčíť. Z miestnosti opäť počuť strašný rev a krik. Keď vyjde von, dostane tú istú otázku ako kováč - čo sa tam dialo, keď tak strašne kričal. Krajčír hovorí: "Košeľu mi na nahé telo prišívali."\r\nNakoniec ide do miestnosti cukrár. Z miestnosti sa po chvíli začal ozývať neuveriteľný krik, horší ako krik kováča a krajčíra. Keď nakoniec vyšiel cukrár von, ostatní dvaja sa ho pýtajú, prečo tak hrôzostrašne kričal a cukrár im hovorí: "Vajcia šľahali..."', 930, 4.21, 33),
	(7837, 'Piatkový podvečer v kostole. Pred spovednicou dlhý rad, vnútri unavený farár.\r\n Príde na rad mníška a hovorí:\r\n - Otče, veľmi som zhrešila.\r\n - Ako?\r\n - Zosmilnila som.\r\n - Prepána, a kde?\r\n - Na zájazde. A hneď dvakrát.\r\n - Tak to je vážne sestra, to bude 50x otčenáš a zdravas a do kostolnej kasičky sto eur.\r\n Potom príde na rad jedna babka - bežný prípad.\r\n Po chvíli príde na spoveď ďalšia mníška a spovedá sa:\r\n - Zosmilnila som.\r\n - Kedy?\r\n - Na zájazde.\r\n To už je farárovi divné a dosť ho to štve. Keď po štvrťhodine vojde do spovedelnice ďalšia mníška a povie, že zosmilnila, farár sa rozhorčene spýta:\r\n - Na zájazde?\r\n - Áno, ako to viete?\r\n To už chudák farár nevydrží, vyletí zo spovedelnice celý červený v tvári a pred zrakom vydesených farníkov zúrivo šmarí o zem modlitebnú knižku a zareve:\r\n - Ku*va, taký dobrý zájazd a mňa samozrejme nikto nezavolal!!!', 947, 4.25, 33),
	(7838, 'Vrátnik pri vchode hovorí:\r"Dobrý deň madam, vitajte u nás, máte nádherné detičky. To sú dvojičky?"\rTučná škaredá žena prestane bliakať, potiahne nosom a hovorí:\r"Samozrejme, že nie sú! Starší má deväť a mladší sedem. Prečo si myslíš, že sú to dvojčatá? Vari vyzerajú rovnako, ty idiot?"\r"Absolútne nie," odpovedá vrátnik, "len nemôžem uveriť tomu, že by vás niekto trt*kal dvakrát!"', 427, 4.17, 33),
	(7839, 'Chuck Norris bude žiť tak dlho, že sa nedožije svojej smrti.', 64, 3.53, 33),
	(7840, 'Viete čo Chuck Norris nevie? \r\nVyžiť zo slovenskej výplaty.', 63, 3.93, 33),
	(7841, 'Sedí indián hore na vodopáde a dolu v rieke mu žena perie oblečenie. Zrazu sa odvalí kameň a ženu zabije. \r\nIndián sa tomu prizerá a hovorí si: Toto je už tretia práčka, čo mi ju tento týždeň, zničil vodný kameň.', 233, 3.94, 33),
	(7842, 'Chlapec s oteckom stoja pred horiacim domom a po chvíli sa synček spýta otecka: Ocko, a nebude tá praženica už hotová?', 125, 4.14, 33),
	(7843, 'Detská modlitba:\r\nAnjeličku môj strážničku, \r\nvysliš túto modlitbičku. \r\nNechcem byť už hladný, smädný,\r\nnechcem žiť ten život biedny.\r\n\nAnjeličku do rána,\r\nurob zo mňa cigáňa. \r\nChcem doma sedieť na podpore, \r\nžiť si na vysokej nohe.\r\nOd štátu brať zdarma byty,\r\nuž nebyť hladný, ale sýty. \r\n\nOslobodený od daní, \r\nbyť pánom a nie poddaným. \r\nŽiť si ako prasa v žite, \r\nžiť v slovenskej realite, \r\nkde slušní majú holú riť \r\na čierny môžu krásne žiť...', 506, 4.19, 33),
	(7844, 'Dievča hovorí otcovi:\r\nOci...jeden chlapec v škole mi povedal niečo, čomu som nerozumela... Povedal, že mám pekné čelné sklo, prekrásny kufor, super karosériu a moje nárazníky sú bezchybné.\r\nOtec na to:\r\nTak mu povedz, že si ešte v záruke, a ak sa opováži zdvihnúť kapotu, aby skontroloval hladinu oleja, tak mu urvem výfuk!', 348, 4.16, 33),
	(7845, '11. Božie prikázanie:\r\nCti syna svojho, aby ťa nevyhodil z domu tvojho.', 74, 4, 33),
	(7846, 'Keď som bola malá,\r\ndo gatí som srala.\r\nTeraz som už veľká,\r\nseriem do vedierka.', 86, 3.85, 33),
	(7847, 'Keď to vyzerá, že si chce Chuck Norris podrezať žili, iba si brúsi nože.', 79, 3.41, 33),
	(7848, 'Na Zem lieta tak veľa ufónov preto, pretože i ufóni chcú podpis Chucka Norisa.', 83, 3.43, 33),
	(7849, '- Názov lieku proti AIDS?\r\n- NETR*KAŤ.', 40, 3.11, 33),
	(7850, 'Volá poslucháč do rádia: "Prosím vás, zahrajte môjmu kamarátovi, ktorý dnes zomrel tragickou autonehodou, pesničku od Desmodu, v ktorej sa spieva CHCEL SOM NÁJSŤ ZÁCHRANNÝ PÁS."', 192, 3.72, 33),
	(7851, 'V obchode:\r\nZákazník: \r\n- Čo je tamto? (ukazuje na regál)\r\nPredavač: \r\n- To sú jablká.\r\n- Tak mi dajte 40 jabĺk a každé mi zvlášť zabaľte. A čo je tamto?\r\n- To sú hrušky.\r\n- Tak mi ich dajte 50 a každú mi zvlášť zabaľte. A čo je tamto?\r\n- To je mak, ale nechcite ma naštvať!', 300, 3.49, 34),
	(7852, 'Vojde róm do obchodu a pýta sa predavačky:\r\n- Koľko stojí ta 12 korunová čokoláda?', 90, 3.95, 34),
	(7853, '- Prosím si 100 guličiek naftalínu!\r\n- Vari máte toľko molí?\r\n- Nie. Mám len jednu, ale nemôžem ju trafiť...', 118, 3.31, 34),
	(7854, 'Príde kura do mäsiarstva a hovorí:\r\n- Chcelo by som jedno kuracie stehno.\r\nMäsiar vyberie sekeru, rozseká ho na malé kúsky a prehodí:\r\n- Čo ste to vlastne chcelo?\r\nPotom príde kohút a opýta se:\r\n- Kde je moje kura?\r\nMäsiar mu odsekne hlavu, tá spadne na rozsekané kura a mäsiar povie:\r\n- Pozri sa zblízka.', 322, 2.74, 34),
	(7855, 'V reštaurácii: \r\n- Čašník, to jedlo bolo vynikajúce. Kuchár je na dovolenke?', 83, 3.16, 34),
	(7856, 'Príde kostra do mäsiarne a mäsiar sa jej pýta:\r\n- Čo si prajete?\r\n- Ó, ja nič. Ja sa len pozerám, čo sa dnes nosí.', 124, 3.65, 34),
	(7857, 'Zákazník sa pýta predavačky:\r\n- Ako sa otvára táto škatuľa?\r\nPredavačka:\r\n- Návod je vo vnútri.', 106, 3.49, 34),
	(7858, 'Prečo nemajú ryby prsty? \r\nLebo im ich obsekal kapitán Iglo.', 63, 3, 34),
	(7859, 'V reštaurácii:\r\n- Je tá vaša slimačia paštéta naozaj zo slimákov?\r\n- Áno.\r\n- A skutočne iba zo slimákov?\r\n- No, keď sa už tak pýtate, pravdupovediac miešame k tomu aj trochu bravčoviny.\r\n- A koľko?\r\n- Pol na pol, jeden slimák jedno prasa.', 256, 3.63, 34),
	(7860, 'Príde pán do predajne so spodnou bielizňou a chce kúpiť svojej manželke podprsenku. Predavačka sa ho pýta:\r\n- Aké číslo nosí vaša pani? \r\n- To sú aj čísla?\r\n- No možno by vám pomohlo, ak si predstavíte, či prsia vašej manželky sú ako jabĺčka, alebo ako melóniky. - pomáha mu predavačka.\r\n- No to by išlo. Tak mi ukážte niečo, ako pre uši poľovníckeho psa.', 390, 3.17, 34),
	(7861, 'Príde hanblivý muž do lekárne a potichu hovorí: \r\n- Prosil by som si intímny krém.\r\nLekárnik mu odpovedá: \r\n- Nahlas!\r\n- Nie na hlas! Na vtáka!', 153, 3.27, 34),
	(7862, 'Škót ide po ulici a vietor mu uchytí starý, umastený, ošúchaný klobúk. Ide do klobučníctva, pozdraví a hovorí \r\n- No, a tak som tu zas.', 148, 3.12, 34),
	(7863, 'Príde ryba do obchodu a pýta sa predvačky:\r\n- Máte rybu?\r\n- Bohužial nemáme.\r\nRyba jej nato: \r\n- Tak tu ma máte! ', 120, 3.07, 34),
	(7864, 'Príde deduško do predajne a pýta sa predavačky:\r\n- Pani, máte vajcia?\r\n- Áno.\r\n- Pani, vy ste veľmi čudná žena.', 121, 2.98, 34),
	(7865, 'Ide babka od obchodu a pýta si sardinky. Predavačka sa jej pýta:\r\n- Aké? Portugalské, Chorvátske?\r\n- To je jedno. Aj tak sa s nimi nebudem rozprávať.', 157, 3.15, 34),
	(7866, 'V predajni:\r\n- Dobrý deň, pane. Čo vám dám?\r\n- No ja síce niesom Van Damme, ale polichotili ste mi.', 105, 2.89, 34),
	(7867, 'Príde kostra do mäsiarstva a predavačka sa jej pýta:\r\n- Čo si prosíte?\r\n- Ale nič ďakujem, len sa pozerám, čo sa teraz nosí.', 135, 3.67, 34),
	(7868, 'Príde dedko do drogérie a predavačka sa ho pýta: \r\n- Čo si prosíte dedko?\r\nDedko na to : \r\n- No, papier.\r\n- A aký papier?\r\n- No, veď viete, taky, no na zadok!\r\n- Ahaaa, myslíte toaletný.\r\n- Áno, presne.\r\n- A čo ešte dedko?\r\n- No, ešte by som potreboval mydlo.\r\n- Toaletné?\r\n- Nie, na ruky.', 304, 3.23, 34),
	(7869, 'Príde hrbatý do obchodu a predavač sa ho pýta:\r\n- A čo sa pán tak zakráda?', 81, 3.36, 34),
	(7870, 'Príde chlapík do obchodu a pýta si kondóm. Predavačka odpovie.\r\n"Neviete si to vypýtať aj slušnejšie?"\r\nChlapík porozmýšla. O chvíľu rozopne nohavice a povie:\r\n"Jeden oblek pre tohto pána."', 204, 3.4, 34),
	(7871, '"Tak toto je prepadnutie, kričí na pokladníčku lupič a v ruke drží pištol."\r\n"Mladý muž", prosí ho žena za priečinkom, "upravte si kravatu a usmievajte sa, práve vás filmuje súkromná televízia."', 212, 3.36, 34),
	(7872, 'Príde chlapík do obchodu:\r\n- Dobrý deň, máte vedro?\r\n- Áno, chcete 7, 8, 9, 10-litrové?\r\n- Hmm, 7 litrové.\r\n- Máme modré, červené, zelené a žlté.\r\n- Dajte mi modré.\r\n- A na čo ho potrebujete?\r\n- Ale, horí mi byt.', 230, 2.89, 34),
	(7873, 'V reštaurácii:\r\n- Pán vrchný, na ten vyprážaný syr s hranolkami čakám už dve hodiny !\r\n- To vám nemusí vadiť, máme otvorené až do rána.', 152, 3.06, 34),
	(7874, 'Príde zajko do obchodu a pýta sa: \r\n- Máte tonu hrášku?\r\nNemáme odpovie predavač. Zajko takto chodí každý deň až sa predavač nahnevá a objedná tonu hrášku. Na druhý deň príde zajko do obchodu a pýta sa:\r\n- Máte tonu hrášku?\r\nMame odpovie mu predavač. A zajko na to:\r\n- To je ale guličiek, čo?', 319, 3.32, 34),
	(7875, 'Koktavý muž príde v noci do lekárne a zaklope na okienko. Otvorí mu ospalý predavač a pýta sa:\r\n"Čo chcete?"\r\nKoktavý chce požiadať o hiperol a tak hovorí:\r\n"hip hip ..."\r\nPredavač ho preruší:\r\n"Hurá!"\r\n... a zavrie okienko.', 241, 3.38, 34),
	(7876, 'Príde chlapík do baru a objedná si tri poldeci vodky a deci sódy. Vypije deci sódy a tri vodky naleje do decáka. Barman: \r\n- Vy musíte byť kúzelník.\r\nChlapík: \r\n- Nie. Štátna obchodná inšpekcia.', 209, 3.44, 34),
	(7877, 'Akcia v obchode s obuvou: \r\n"Za každé dve topánky, ktoré si u nás kúpite, dostanete ďalšiu zdarma!"', 107, 3.23, 34),
	(7878, 'Mäsiar chce predať prasa, ale pokazí sa mu váha, preto sa dohodne so svojou manželkou, že povedia rovnakú váhu - 150 kg. Príde kupujúci a pýta sa na váhu. Mäsiarovi nepríde nič múdrejšie na rozum, tak chytí prasa za ocas, párkrát pošúcha v rukách a povie:\r\n- 150kg! \r\nKupujúci tomu samozrejme neverí, tak mäsiar pošle svojho syna po ženu. Syn o chvíľu príde a hovorí: \r\n- Mama nomôže, teraz váži poštára!', 442, 3.32, 34),
	(7879, '- Pán hlavný, to nie je polievka, ale akási voda.\r\n- Nie akási, ale prevarená.', 83, 3.21, 34),
	(7880, 'Ide slepec s vodiacim psom po ulici a rozhodne sa ísť do obchodu. Tak vojde do obchodu, chytí psa za zadné laby a začne s ním krútiť nad hlavou. Príde k nemu predavačka a nechápavo sa pýta:\r\n- Pane, prosím vás, čo to robíte?\r\nA slepec jej na to:\r\n- Rozhliadam sa!', 279, 3.3, 34),
	(7881, '- Pán vedúci, už ste dostali toto oné do teho oného?\r\n- Áno, práve vybaľujeme.', 86, 3, 34),
	(7882, 'Dežko robí záverečné skúšky na predavača v drogérii. Šéf skúšobnej komisie sa ho pýta:\r\n- Dežko, čo by si ponúkol pani, ak by chcela niečo na vyčistenie okna?\r\n- Okenu!\r\n- Správne Dežko. A čo by si jej ponúkol, keby chcela niečo na umytie dverí?\r\n- Okenu!\r\n- Ale prečo okenu?\r\n- Lebo existujú aj dvere so sklenenou výplňou.\r\n- Dobre Dežko. A čo by si jej ponúkol, keby mala svoje dni?\r\n- Okenu!\r\n- Ale to snáď nie, prečo opäť okenu?\r\n- Lebo keď sa nomôže milovať, nech aspoň poumýva okna!', 531, 3.42, 34),
	(7883, 'Príde mladý otecko do obchodu kúpiť bábiku Barbie pre svoju dcérku. Predavač mu ponúka rôzne typy: \r\n- Barbie ide nakupovať za 380, barbie ide na disco za 700 a rozvedená Barbie za 6000. \r\nOtecko sa začudovane spýta:\r\n- Prečo je rozvedená Barbie taká drahá? \r\nPredavač na to: \r\n- To viete, má k tomu Kenov dom, Kenovo auto...', 344, 3.56, 34),
	(7884, 'Do obchodu s koženou galantériou vojde zákazník:\r\n- Prosil by som si rukavice na šoférovanie.\r\n- Aké číslo? - pýta sa predavačka.\r\n- BAV 20-83.', 154, 3.08, 34),
	(7885, 'Predavač platní stojí na rebríku a ukladá platne do regálov. Príde zákazník a pýta sa:\r\n"Dobrý deň, máte Modré ruže od Dusíka?"\r\n"Nie, iba modré gule od rebríka."', 180, 3.28, 34),
	(7886, 'Príde muž do predajne s domácimi potrebami a pýta si neónku do kuchyne:\r\n- Prosím Vás, máte neónku typu OSRAM?\r\nPredavačka mu odpovedá:\r\n- Bohužial, mame iba neónky typu TUNGSRAM.\r\nMuž sa zamyslí a povie:\r\n- Viete čo, dajte mi aj TUNGSRAM, ja si ju už doma OSRAM!!!', 282, 2.88, 34),
	(7887, 'Zákazník v cukrárni:\r\n- Prosím vás, máte veterník?\r\n- Áno.\r\n- Tak mi dajte punčový rez.', 97, 3.09, 34),
	(7888, 'V obchode:\r\n- Dobrý deň! Prosím si kilo pomarančov.\r\n- Budete si ich želať aj zabaliť?\r\n- Nie! Budem si ich kotúlať až domov!', 135, 3.15, 34),
	(7889, '- Čašník, prečo mám v polievke komára?\r\n- Veľmi ma to mrzí, ale dnes je mucha na služobke!', 99, 3.01, 34),
	(7890, 'Chlapík nakupuje na Miletičke a pýta sa Vietnamca:\r\n- Čo stoja tieto tepláky?\r\n- Triset, triset.\r\n- Toľko nemám to je drahé!\r\n- Dveset, dveset.\r\n- Máte pokladničný blok?\r\n- Sto, sto.\r\n- A máte povolenie tu predávať?\r\n- Darcek, darcek.', 248, 3.3, 34),
	(7891, 'Ako sa po polsky povie šampón proti lupinám?\r\nPjona na glavu dľa odstranenja čipsov pačesowich.', 101, 3.04, 34),
	(7892, 'Príde báčik z lazov do mesta a vojde do obchodu. \r\n- Dobrý deň. Viete, ja som z lazov a hľadám také červené trenírky a biele tričko, viete ako mali chlapci na spartakiáde. Mne sa to veľmi páči. \r\nPredavačka mu hovorí:\r\n- Ľutujem nemáme, ale máme modrobiele trenky a biele tričko, viete takú súpravičku.\r\nBáčik poďakuje a odíde do druhého obchodu. Situácia sa opakuje. Predavačka:\r\n- Nie ľutujem, máme len modrobiele trenky a biele tričko, viete takú súpravičku.\r\nBáčik odíde do ďalšieho obchodu a tam sa situácia opakuje. Predavačka:\r\n- Nie, ľutujem, máme len modrobiele trenky a biele tričko, viete takú súpravičku.\r\nTak báčik zas odíde ale v tom vybehne za ním predavačka a pýta sa ho:\r\nBáčik vy ste z lazov?\r\n- Hej som.\r\n- A vajíčka máte?\r\n- Hej mám a pipíša, viete takú súpravičku!', 853, 2.95, 34),
	(7893, 'Príde slepec do obchodu a začne točit slepeckého psa nad hlavou. Predavačka sa pýta:\r\n"Preboha, čo to robíte?"\r\n"To nič, len sa obzerám."', 147, 3.15, 34),
	(7894, 'Príde Norbert do obchodu a predavač sa ho dotieravo pýta:\r\n"Čo to bude?"\r\n"Jednu žuvačku si prosím."\r\n"Jednu?"\r\n"Nie tisíc!"\r\n"Prepáčte, ale tisíc nemáme."\r\n"Tak čo strúhaš machra?"', 196, 3.1, 34),
	(7895, 'Príde Janko do obchodu a pýta sa: \r\n"Dobrý deň máte milión rožkov?"\r\n"Nie nemáme."\r\nPríde na druhá deň.\r\n"Dobrý deň máte milión rožkov?"\r\n"Nie nemáme."\r\nPríde na tretí deň.\r\n"Máte milión rožkov?"\r\n"Áno máme."\r\n"Tak to som zvedavý ktorý blbec vám ich kúpi."', 285, 2.84, 34),
	(7896, 'Janko príde do obchodu nakupovať a pýta sa predavačky.\r\n"Čo je tamto ?"\r\n"To sú jablká."\r\n"Tak mi dajte kilo a každé mi zabalte zvlášť."\r\nPredavačka zabalí.\r\n"A čo je tamto ?"\r\n"To sú banány."\r\n"Tak mi dajte kilo a každý mi zabaľte osobitne."\r\nPredavačka zabalí.\r\n"A čo ja tamto?"\r\n"To je mak, ale zabudni na to!"', 336, 3.2, 34),
	(7897, 'Prečo nie je možné dostať z hovädzích paštét BSE?\r\nPretože potkany BSE nemajú.', 88, 3.17, 34),
	(7898, 'Príde dementný chlapec do obchodu a hovorí predavačke:\r\n"Uhmaahaeeua coly!"\r\nPredavačka sa na neho začudovane pozrie a odpovie:\r\n"Dva deci čoho? "', 153, 3.33, 34),
	(7899, 'Zákazník si objednáva pri pulte:\r\n- Dva párky si prosím.\r\nHlas z radu:\r\n- Hráš sa na veľkého pána, čo?\r\n- A šestnásť príborov si prosím.', 152, 3.11, 34),
	(7900, 'Príde chlapík do drogérie a hovorí predavačke:\r\n- Ten sprej sa volá ako ja.\r\nPredavačka nechápe a pýta sa:\r\n- Ako?\r\n- Že ten sprej sa volá ako ja!\r\n- Vy ste HUGO BOSS?\r\n- Nie, ja som Dežo Dorant.', 207, 3.28, 34),
	(7901, '- Je to kapor?\r\n- Pstruh.\r\n- Je čerstvý?\r\n- Živý.\r\n- Ale veď sa nehýbe.\r\n- Spí.\r\n- Ale smrdí.\r\n- Vy keď spíte, neprdíte?', 131, 3.2, 34),
	(7902, 'V obchode:\r\n- Máte živé ryby?\r\n- Máme.\r\n- A sú čerstvé?', 62, 3.41, 34),
	(7903, 'Dievčatko príde do obchodu a prezerá si macíkov. Predavač sa jej pýta:\r\n- Chceš toho bieleho macíka s modrými labkami, alebo modrého macíka s bielymi labkami?\r\n- Myslím, že môjmu pittbulovi to bude jedno.', 218, 2.77, 34),
	(7904, 'Intelektuál príde do kníhkupectva a pýta si:\r\n- Chcel by som si kúpiť nejakú hodnotnú knihu, nijaký sex, žiadne vraždy, konzumné hodnoty a sladkosti.\r\n- To vám teda odporúčam zimný cestovný poriadok pre železnice - radí mu predavačka.', 254, 2.95, 34),
	(7905, '- Všímajte si viac ľudí, - karhá vedúca predavačku, - tamten pán, čo odišiel, pýtal tri mydlá a odniesol so sebou štyri.\r\n- To je dobre. Veď zaplatil za päť!', 173, 3.13, 34),
	(7906, 'V reštaurácii:\r\n- Pán vrchný, som hladný ako vlk. \r\n- Prepáčte, ale červené čiapočky na jedálnom lístku nemáme.', 125, 3.22, 34),
	(7907, 'Chlapík v mäsiarstve:\r\n- Prosím si liter mäsa.\r\n- Aj zabaliť?', 66, 3, 34),
	(7908, 'Príde slečna do obchodu, kúpiť si šaty. Oblečie ich na seba a pýta sa predavača:\r\n- Pane, nezdá sa vám, že je ten výstrih veľký?\r\nPredavač na ňu pozrie a pýta sa:\r\n- Slečna, máte ochlpené prsia?\r\nOna na neho udivene pozrie a rázne odpovie:\r\n- No dovoľte! Nie!\r\nA predavač na to:\r\n- Tak potom je ten výstrih veľký.', 339, 2.91, 34),
	(7909, 'Chlap nakupuje obrovské množstvo kondómov. Mladá predavačka sa mu prihovára: \r\n- Však ste Vy slobodný?\r\nMladý muž polichotene odpovedá: \r\n- Áno, ako to viete?\r\n- Lebo ste strašne škaredý!', 202, 3.44, 34),
	(7910, 'Čašník nesie zákaznikovy jedlo a prstom pridržiava mäso. Zákaznik to vidí a hned ho okríkne. \r\n- Čo to znamená, prečo máte prst na mojom rezni?\r\n- To preto, aby mi už po tretí raz nespadol.', 204, 3.25, 34),
	(7911, 'Dnešní obchodníci si vedia poradiť:\r\n- Prosím si za korunu droždie.\r\n- Nech sa páči! Tri päťdesiat.', 109, 2.99, 34),
	(7912, 'Pán v obchode si skúša nohavice.\r\nPredavačka: - Tie nohavice vám sedia ako uliate.\r\nZákazník: - Čo ja viem... Trochu ma tlačia pod pazuchami.', 150, 3.38, 34),
	(7913, 'Príde chlapík do reštaurácie a objedná si polievku. O chvíľu zavolá na čašníka a hovorí:\r\n- Mohli by ste, prosím vás, ochutnať z mojej polievky?\r\nČašník na to:\r\n- Prečo? Je studená?\r\n- Nie, len z nej ochutnajte!\r\n- Prečo? Azda je prislaná?\r\n- Nie! Dopekla, však z nej už ochutnajte!\r\n- Dobre, dobre, ale kde je lyžica?\r\n- AHA?!', 352, 3.58, 34),
	(7914, 'Chlapík príde do zelovocu.\r\n- Dobrý deň!\r\n- Dobrý!\r\n- Poprosil by som vás kilo pomarančov!\r\n- Áno, prosím nech sa páči. Mám vám ich aj zabaliť?\r\n- Nie, budem si ich kotúlať domov, ty krava!', 205, 2.98, 34),
	(7915, 'Do fotoshopu príde zákazník a hovorí:\r\n- Chcel by som si z tohto filmu dať spraviť fotky.\r\n- 9x13?\r\n- 117, prečo sa pýtate?', 131, 3.05, 34),
	(7916, '- Dobrý deň. Máte vajcia?\r\n- No ale my tu vajcia nedržíme.\r\n- Ja nechcem podržať, ja chcem kúpiť! ', 107, 3.18, 34),
	(7917, 'Príde chlap do drogérie, vysype na stôl hromadu prezervatívov:\r\n"Zožerte si tie vaše prezervatívy!"\r\n"Prečo pane, trhajú sa vám?"\r\n"Nie. Ohýbajú."', 158, 2.92, 34),
	(7918, 'Čukča v obchode:\r\n"Máte šampón?"\r\n"Áno, ale iba vaječný".\r\n"To je škoda, ja ho potrebujem na hlavu."', 109, 3.08, 34),
	(7919, '- Mám len dve koruny, čo mám urobiť?\r\n- Kúpte si guľku a pištol vám požičiam.', 87, 2.98, 34),
	(7920, 'Pani v obchode:\r\n- Nemáte niečo čerstvo zarezané?\r\n- Hej, trenírky do zadku.\r\n- Ale ja myslím od hydiny.\r\n- Osraté schody.', 129, 3.1, 34),
	(7921, 'Príde pani k mäsiarovi a pýta sa: \r\n- Máte niečo čerstvo zarezané? \r\n- Mám. Trenírky v zadku.', 102, 2.92, 34),
	(7922, 'Veliký, obrovský mnohoposchodový supermarket v USA, v ktorom dostanete všetko. Šéf prijíma nového predavača, s tým, že ho vezme na deň na skúšobnú dobu, aby videl, ako sa osvedčí. Po záverečnej si ho zavolá do kancelárie:\r\n- Tak koľko ste dnes urobil obchodov?\r\n- Jeden, šéfe.\r\n- Čože!? Jeden? Naši predavači urobia priemerne šesťdesiat až sedemdesiat obchodov denne! Čo ste celý deň robil!? A koľko ste vlastne utŕžil?\r\n- Tristoosemdesiat tisíc dolárov.\r\nŠéfovi došla reč. \r\n- Tristoosemdesiat tisíc? Preboha, čo ste predal?\r\n- No, prvý som predal malinký háčik na ryby...\r\n- Háčik na ryby? Za tristo osemdesiat tisíc?\r\n- ... potom som zákazníka presvedčil, že by si mohol zobrať ešte aj stredný a veľký háčik. Potom som ho presvedčil, že by si mal zobrať aj nejakú udicu, predal som mu tri prúty - malý, stredný a veľký. Dal som sa s ním do reči, opýtal som sa, kde bude rybáriť. Povedal, že na myse dvadsať míľ na sever. Tak som mu predal ešte poriadnu vetrovku, nepremokavé nohavice a gumáky, pretože tam dosť fuka. Presvedčil som ho, že na pobreží neberú, tak sme išli vybrať motorový čln. Potom som sa ho opýtal, čo má za auto - vyliezlo z neho, že dosť malé, čln by na ňom nemohol odviesť. Tak som mu predal ešte príves...\r\n- A toto všetko ste predal človeku, ktorý si prišiel kúpiť jediný háčik na ryby!?\r\n- Nie. On pôvodne prišiel kúpiť vložky pre svoju ženu. Tak som mu navrhol, že keď si teda cez víkend neužije, že by si mohol zájsť aspoň na ryby...', 1590, 3.77, 34),
	(7923, 'Príde muž do potravín a pýta sa mladej predavačky: \r\n- Máte fínsku vodku? \r\n- Nemáme. \r\n- Máte Johnie Walker? \r\n- Nemáme. \r\n- A máte dnes večer čas? \r\nPredavačka sa pousmeje a odvetí: \r\n- Mám.\r\n- Tak si láskavo sadnite a vypíšte objednávku!', 260, 3.16, 34),
	(7924, 'Rozhorčený mladý muž príde do drogérie, vypýta si knihu prianí a sťažností a píše sťažnosť na zakúpené prezervatívy, ktoré údajne prepúšťajú.\r\nPočuje to starší pán, súhlasne pritakáva a hovorí:\r\n- Máte pravdu mladý pán, veru tak, len im dajte, a ešte tam pripíšte, prosím pekne, že "spadúvajú"!', 336, 3.07, 34),
	(7925, 'Do obchodu príde korpulentná pani a vraví predavačovi: \r\n- Rada by som videla nejaké plavky, čo by mi pristali.\r\n- Aj ja, odvetí predavač.', 146, 3.3, 34),
	(7926, 'V reštaurácií si zákaznik objedná polievku, ktorú mu čašník po chvíli aj donesie. Náš zákazník si však všimne, že čašník má celý jeden prst v polievke ponorený. Rozčúlený zákazník čašníkovy hneď bez ostychu poradí, kam si ten prst má nabudúce strčiť.\r\nČašník sa však iba pousmeje a odpovie:\r\n- Nebojte sa, veď keď práve neobsluhujem, vždy ho tam mám.', 396, 3.14, 34),
	(7927, 'Přijde chlap do obchodu a říká: "brrlumghjkgdderškyt BRAMBOR"\r\nA prodavačka: "Pět kilo čeho?"', 101, 3.11, 34),
	(7928, 'Hosť zavolá vrchného a sťažuje sa mu:\r\n-"Ťa fašírka je strašne tvrdá."\r\nVrchný mu odpovedá:\r\n-"Mame málo psov, melieme aj s búdami!', 145, 3.12, 34),
	(7929, 'Pán príde do obchodu a chce kúpiť pre manželku podprsenku, ale nevie číslo. Predavačka mu pomáha:\r\n- Aké prsia má pani manželka? Ako citróny? Ako grapefruity? Ako kokosové orechy?\r\nPán pochopí, usmeje sa a hovorí:\r\n- Viete aké uši má kokršpaniel?!', 268, 3.29, 34),
	(7930, '- Pani, ten koláč je akýsi tvrdý a bez chuti. \r\n- Ja som piekla skôr, ako vy ste prvý koláč videl. \r\n- To vám verím, ale prečo ich predávate až teraz?', 163, 3, 34),
	(7931, 'Príde muž do zelovocu a chce byť zábavný. Tak spustí: \r\n- Máte mandarinky-rinky?\r\nPredavačka: \r\n- Áno, máme.\r\n- A pomaranče-ranče?\r\n- Aj tie máme.\r\n- A čože ste tu tak sama? Kde sú vaše kolegyne-gyne?\r\n- Sú vzadu a oddychujú-chujú.', 251, 3.46, 34),
	(7932, 'Okolo reštaurácie sa obšmieta tulák, taky žobrák otrhaný. Kuchár to už nevydrží, lebo mu plaší zákazníkov a skríkne :\r\n- Vypadni alebo chceš po hube ?\r\nŽobrák:\r\n- Nie, do HUBY!', 195, 3.13, 34),
	(7933, 'Ide chlapík do mäsiarne a pýta si 1 kg kostí pre psa. Predavačka sa pýta:\r\n- Zabaliť?\r\n- Nie, tu zjem.', 109, 3.22, 34),
	(7934, 'V obchode so zbraňami:\r\n- Pán predavač, ešte raz. S tlmičom a samozrejme, že na poľovanie.', 97, 3.33, 34),
	(7935, 'V obchode so zbraňami:\r\n- Pán predavač, ešte raz. S tlmičom a samozrejme, že na obranu.', 93, 3.27, 34),
	(7936, 'Príde starší pán do obchodu a pýta sa:\r\n- Máte dnešný chlieb?\r\n- Nie, iba včerajší..\r\n- A kedy bude dnešný?\r\n- Zajtra.', 131, 3.15, 34),
	(7937, 'Príde mladá slečna do obchodu, postaví sa k pultu a vraví šarmantnému predavačovi:\r\n- Potrebujem čiastiaci prostriedok.\r\nPredavač na to:\r\n- Tento za vás urobí polovicu práce. \r\n- Tak mi dajte dvojité balenie, prosím! ', 232, 3.05, 34),
	(7938, 'Príde elegantná dáma do klobučníctva a začne prezerať tovar. Úslužný predavač k nej hneď priskočí a začne poklonkovať.\r\n- Chcela by som nejaký klobúk.\r\n- Áno, áno, mladá pani samozrejme a čo konkrétne máte na myslí?\r\nDáma si ho mrazivo prezrie:\r\n- Tak konkrétne na myslí mám poriadne milovanie, ale od vás by som chcela len ten klobúk.', 366, 3.15, 34),
	(7939, 'Príde chlapík do obchodu a pýta sa: \r\n- Máte, prosím vás, lieh denaturák?\r\n- Nie.\r\n- A iné fajnové vínko?', 115, 3.08, 34),
	(7940, 'Príde američan k novinovému stánku a pýta sa:\r\n- Do you speak english?\r\nStánkar rozpačito krúti hlavou a tak to američan ide skúsiť inam. U ďalšieho stánku sa znova spýta:\r\n- Do you speak english?\r\nDruhý stánkar len neisto. \r\n- Ako prosím?\r\nA tak už celkom zúfalý príde k tretiemu stánku a nesmelo sa spýta: \r\n- Do you speak english?\r\n- Yes, I am speaking english very well. What can I do for you?\r\n- Marlboro.', 434, 3.52, 34),
	(7941, 'Vedúci predajne sa pýta ráno predavačky: \r\n"Tak ako ste sa túto noc vyspinkali, Anička?" \r\n"Nuž, tak ako predavačka. Svoj krám som mala otvorený celú noc a zákazník neprišiel."', 190, 3.46, 34),
	(7942, 'Curt Cobain stojí v obchode so zbraňami a nemôže sa rozhodnúť, ktorú z nich si vezme. Znudený predavač sa naň chvíľu díva a potom navrhne:\r\n- Tak viete čo, vezmite si ju domov, nechajte to prejsť hlavou a uvidíte. ', 230, 3.33, 34),
	(7943, 'Príde chlapec do mäsiarstva a pýta sa predavača: "Máte bravčovú hlavu?" Predavač hovorí: "Mám." A chlapec mu na to: "Tak vám treba!"', 143, 3.32, 34),
	(7944, 'Barmanka sa pýta hosťa:\r\n- Pane, Vám nechutí to víno čo som Vám priniesla, že ste sa tak zatvárili?\r\n- Ale nie, víno mi chutí, tvár sa mi skrivila až keď som sa pozrel na Vás.', 190, 3.58, 34),
	(7945, 'V reštaurácii si hosť rozkazuje:\r\n- Pán čašník, prosím si jeden chlebík. Ale dávajte pozor! Odkrojený chlieb nech je hrubý 1cm a potrite ho 10 g masla, šunka nech nie je mastná a nech je z dvoch kúskov po 30g a pridajte 4 kúsky párky v priemere každej po 4cm.\r\n- Rozumiem pane, ale musíte zaplatiť dopredu.\r\n- No dobre, a koľko?\r\n- 60 korún, ale dávajte pozor! Musia to byť 3 dvadsaťkorunáčky z minulého roka a čísla série sa musia končiť na 77.', 478, 3.77, 34),
	(7946, 'Pošle mama Jurka do obchodu a vraví mu, aby na všetko vravel áno. V obchode sa pýta Jurka predavačka, či chce nový tovar. Jurko odpovie, že áno. Vyjde von a počas cesty domov stretne boxeristov. Tí sa ho pýtajú, či chce cez hubu a Jurko im odpovie áno, tak ho zmlátia.\r\nNa druhý deň pošle mama opäť Jurka do obchodu a vraví mu, aby na všetko vravel nie. Príde do obchodu kde sa ho predavačka pýta, či chce nový tovar. Jurko odpovie nie a ide z obchodu preč. Vonku znova stretne boxeristov a tí sa ho pýtajú: "Ešte ti nestačilo?". Jurko odpovie, čo mu mama prikázala a boxeristi ho opäť zmlátia. ', 635, 2.67, 34),
	(7947, 'Traja podnikatelia sa prihlásili na konkurz na opravu plota okolo Ministerstva financií SR:\r\nPoliak vzal pásmo, zmeral dĺžku plotu, všetko si načrtol na papier, niečo popočítal a vraví:\r\n"Spravíme to za 350.000 Sk = 200.000 Sk materiál, 100.000 Sk pre robotníkov a 50.000 Sk je marža firmy."\r\nUkrajinec vzal palicu, niečo pomeral, niečo pokreslil, niečo popočítal a hovorí:\r\n"My to spravíme za 250.000 Sk = 150.000 Sk materiál, 50.000 Sk pre robotníkov a 50.000 Sk je marža firmy."\r\nSlovák sa neobťažoval žiadnym meraním, nákresmi ani výpočtami, pristúpil k úradníkovi a pošepol mu: "My to urobíme za 2.250.000 Sk.\r\nMinisterský úradník zalapal po dychu: "Ako ste došiel k tak vysokej sume?"\r\n"Milión tebe, milión mne a za 250.000 Sk to objednáme tuto u Ukrajinca!"', 809, 4.17, 34),
	(7948, 'Veľký, obrovský mnohoposchodový supermarket v USA, v ktorom dostanete všetko. Šéf prijíma nového predavača, s tým, že ho vezme na deň na skúšobnú dobu, aby videl, ako sa osvedčí. Po záverečnej si ho zavolá do kancelárie:\r\n- Tak koľko ste dnes urobil obchodov?\r\n- Jeden, šéfe.\r\n- Čože!? Jeden? Naši predavači urobia priemerne šesťdesiat až sedemdesiat obchodov denne! Čo ste celý deň robil!? A koľko ste vlastne utŕžil?\r\n- Tristoosemdesiat tisíc dolárov.\r\nŠéfovi došla reč.\r\n- Tristoosemdesiat tisíc? Preboha, čo ste predal?\r\n- No, prvý som predal malinký háčik na ryby...\r\n- Háčik na ryby? Za tristo osemdesiat tisíc?\r\n- ... potom som zákazníka presvedčil, že by si mohol zobrať ešte aj stredný a veľký háčik. Potom som ho presvedčil, že by si mal zobrať aj nejakú udicu, predal som mu tri prúty - malý, stredný a veľký. Dal som sa s ním do reči, opýtal som sa, kde bude rybárčiť. Povedal, že na myse dvadsať míľ na sever. Tak som mu predal ešte poriadnu vetrovku, nepremokavé nohavice a gumáky, pretože tam dosť fúka.\r\nPresvedčil som ho, že na pobreží neberú, tak sme išli vybrať motorový čln. Potom som sa ho opýtal, čo má za auto - vyliezlo z neho, že dosť malé, čln by na ňom nemohol odviesť. Tak som mu predal ešte príves...\r\n- A toto všetko ste predal človeku, ktorý si prišiel kúpiť jediný háčik na ryby!?\r\n- Nie. On pôvodne prišiel kúpiť vložky pre svoju ženu. Tak som mu navrhol, že keď si teda cez víkend neužije, že by si mohol zájsť aspoň na ryby...', 1593, 4.29, 34),
	(7949, 'Čašník servíruje hosťovi kávu so slovami: "Toto je špecialita až z Južnej Afriky..."Hosť hovorí: "Hneď mi bolo čudné, že ste tak dlho preč."', 156, 3.5, 34),
	(7950, 'Príde pán do reštaurácie a objedná si šalát, polievku a dve žemle. Za chvíľu príde čašník a poukladá to na stôl. Pán zoberie žemle a pýta sa: "Prečo sú tie žemle také mokré?"A čašník mu odpovedá: "No viete, to je tak... Keď v jednej ruke máte polievku, v druhej šalát a pod pazuchami žemle, tak sa človek ľahko zapotí."', 355, 4.12, 34),
	(7951, 'Vola pani(p) do Hot-line centra (h):\r\np: Dobry deň, včera som si kúpila Windows 98.\r\nh: Oó, to je vinikajúce, ďakujeme!\r\np: A dnes mi to celé padlo!!!\r\nh: Ja viem, pred chvíľkou ste mi to povedali...', 208, 3.08, 35),
	(7952, 'Rozpráva sa programátor s iným programátorom: \r\n- Počúvaj, minule som spoznal takú škaredú ženu, že keď mi posielala fotku cez e-mail, odchytil ju antivírus.', 170, 3.68, 35),
	(7953, 'Sedí maniak pred počítačom a zrazu ho trhne:\r\n- Sakra, veď ja som už na tom internete zavislý!\r\nChvíľu rozmýšľa, otvorí si nové okno s browserom a hovorí:\r\n- Hmm... niekde tu na to musí niečo byť.', 214, 3.24, 35),
	(7954, 'Dobrý deň!\r\nSme novozaložená hackerská firma, ktorá sa už 5 týždňov snaží vyvinúť vírus, ktorý vám zmaže obsah pevného disku. Bohužial, nedarí sa nám to, preto vás touto cestou PROSÍME aby ste si váš pevný disk vymazali sami.\r\nZa pochopenie a kladné vybavenie vopred ďakujeme!', 305, 3.07, 35),
	(7955, 'Šéf hovorí sekretárke:\r\n- Katka, prosím ťa, prekopíruj mesačné dáta našim partnerom, oni sa pre ne za chvíľku zastavia.\r\n- Dobrý deň, vám mám prekopirovat tie dáta?\r\n- Dobrý deň, áno áno, prosím, tu máte disketu.\r\n- Ďakujem.\r\nSekretárka strká disketu do mechaniky:\r\n# mkfs -t vfat -c /dev/fd0h1440\r\n# mount -t vfat -o iocharset=koi8-r,codepage=866 /dev/fd0 /mnt/floppy # find / -noleaf -type f -name Otchet_april. [a-zA-Z] -exec cp { }; /mnt/floppy; # ls -la /mnt/floppy/Otchet_april. [a-z][A-Z] && sync && sleep 3\r\n- Tak a je to! - vracia disketu.\r\nPartneri na ňu nechápavo hladia.\r\n- Ach! Zasa som ju zabudla odmountovat?!', 653, 2.45, 35),
	(7956, 'Čo dostaneme, keď odstránime z Windowsu všetky chyby?\r\nPrázdny harddisk...', 79, 3.18, 35),
	(7957, 'Čo má spoločné programátor a opica?\r\nObaja sú neumytí, strapatí a majú mozole na zadkoch.', 98, 2.94, 35),
	(7958, 'V ZOO:\r\n- Mama, pozri, programátori!\r\n- Ale kdeže, synček, to sú opice.\r\n- Aha. A ja som si myslel, že programátori - neumytí, strapatí, mozole na zadku...', 163, 2.88, 35),
	(7959, 'Ako zistite, že je najväčší čas kúpiť si nový počítač?\r\nNa windowse vám bude lagovať Blue Screen.', 111, 2.77, 35),
	(7960, 'Rozprávajú sa dva počítače:\r\n- Počul si ten nový vtip? 00010001010002 \r\n- Hahaha.', 88, 3.17, 35),
	(7961, 'Na svete je 10 druhov ľudí.\r\nTí, ktorí rozumejú programovaniu a tí, ktorí nie...', 87, 2.97, 35),
	(7962, 'Nevybraná dovolená\r\nVážený zamestnanče, vnitropodnikové záznamy ukázaly, že jste si nevybral(a) dovolenou za posledních 100 let.\r\nJsme si jisti, že jste obeznámeni s tím, že všem zamestnancum jsou zaručeny tři týdny placené dovolené ročne, nebo v případe jejího nevybrání následne proplacení. Za každých dalších pět let je pak zaručen další týden placené dovolené.\r\nVyzýváme Vás proto, aby jste si urychleně vybral 9400 dnu dovolené nebo informoval mzdovou učtárnu o tom, že si při příštím výběru výplaty vyberete šek na 18,277,432.22 Kč, v němž je započítán tento refundovaný plat a úroky za posledních 1200 měsícu.\r\nS pozdravem,\r\nautomatizovaný vnitropodnikový systém plateb\r\n01/01/00', 757, 3.36, 35),
	(7963, 'Tatko, potreboval by som nový harddisk.\r\n- A kúzelné slovíčko?\r\n- Do riti! Všetko je dnes zaheslované!', 109, 3.19, 35),
	(7964, 'Víte proč ženský lejou do počítače vodu?\r\nAby mohli surfovat po Internetu.', 81, 2.93, 35),
	(7965, 'Viete ako sa modlia počítačový maniaci?\r\nV mene Otca i Syna i Ducha svätého ENTER!', 88, 3.1, 35),
	(7966, 'Bill Gates zomrel a dostal sa do pekla. Čert mu hovorí.\r\n- Môžeš si vybrať tri miesta, kde budeš tráviť svoj čas. Prvé miesto je horiace jazero, v ktorom plávajú ľudia v strašných mukách. Druhé miesto je obrovská aréna, kde vyhladované levy naháňajú ľudí. Tretia miesto je mala miestnosť so stolom, na ktorom je fľaša vína a počítač.\r\nBill Gates si bez rozmýšlania vyberie túto miestnosť. Čert ho zamkne a otočí sa, pričom narazí do Lucifera. Lucifer sa neho oborí:\r\n- Tento Gates strpčoval život miliónom a ty ho dáš na také miesto!\r\n- To si len myslíš, na tej fľaši nie je diera.\r\n- A počítač?\r\n- Je tam inštalovaný Windows 95 a na klávesnici chýbajú tri klávesy.\r\n- Ktoré?\r\n- Ctrl, Alt a Del.', 758, 3.93, 35),
	(7967, 'Užívatelia medzi sebou:\r\n- Nie som sprostý, len mám v hlave niekoľko chybných sektorov.\r\n- Čierne diery vznikli tak, že Boh delil s nulou.\r\n- Kto je ten Generál Failure, a ako si dovoľuje čítať môj disk?\r\n- V týchto dňoch Microsoft dokončil svoju najnovšiu per-verziu Windows.', 294, 3.03, 35),
	(7968, 'Na čo sa používa tlačiareň?\r\nNa spomalenie pohybu papiera smerom k smetnému košu.', 88, 3.07, 35),
	(7969, 'Ide automechanik, manager a softwarista v aute a zrazu sa auto pokazí.\r\nAutomechanik vraví:\r\n"Otvorte mi kapotu ja sa na to pozriem a dám to do kopy"\r\nManager mu vraví:\r\n"Čo si sprostý? Zašpiníš sa a kde sa umyješ? Pekne ho odtlačíme,tuto za zákrutou je servis a tam nám ho opravia"\r\nA ako ich tak sofwarista počúva tak mu to nedá a vraví:\r\n"Počúvajte a čo keby sme skúsili vystúpiť a nastúpiť???"', 423, 3.53, 35),
	(7970, 'Správca počítačovej siete bol na sekretariáte riaditeľa inštalovať nejaký softvér. Všimol si, že na modernom drahom plochom monitore je nalepený biely krížik, vytvorený z dvoch prúžkov samolepiek. Pýta sa dievčiny - "majiteľky stroja":\r\n- To tam čo máte za ozdobu?\r\n- To nie je ozdoba, ale značka - odvetí dievčina.\r\n- Čo za značka?\r\n- Mám na obrazovke dve ikony na Word. Jedna z nich však nefunguje, tak som  si  ju preškrtla, aby som na ňu zbytočne neklikala.', 494, 3.11, 35),
	(7971, 'Počítačové varovné hlásenie:\r\nToto je odkaz od najvyššieho. Reštart sveta. Prosím odhláste sa!', 105, 2.86, 35),
	(7972, 'Hovorí programátor programátorovi v nočnom v bare:\r\n- Ty počúvaj, pozri na tie slečny. Nejdeme si spojiť "software"?\r\n- Nie! Včera som zisťoval ich properties. Všetky sú read only!', 192, 3.14, 35),
	(7973, 'Ako volá programátor o pomoc keď sa topí?\r\nF1, F1, F1!!!', 60, 3.18, 35),
	(7974, 'Bill Gates sa postaví pred zrkadlo a pýta sa:\r\n- Zrkadielko, povedz že mi, kto je najbohatší na svete?\r\nNa zrkadle sa objaví modrá tabuľka: \r\n\'Program MIRROR provedl neplatnou operaci a bude ukončen.\'', 209, 3.27, 35),
	(7975, 'Kto prvý povedal: ,,A predsa sa točí!"?\r\nVynálezca hard-disku.', 66, 3.29, 35),
	(7976, 'Znaky, ukazujúce na príliš časté používanie počítača:\r\n- Keď na ulici uvidíš kĺbový autobus, rozmýšľaš, či je 16 alebo 32 bitový.\r\n- Pri čítaní knihy na kraji listu hľadáš scroll.\r\n- Vo výťahu 2x klikneš na gombík príslušného poschodia.\r\n- Hľadáš ikonu, pomocou ktorej chceš otvoriť okno v spálni.\r\n- Častejšie vymieňaš chránič obrazovky ako spodné prádlo.\r\n- Tachometer tvojho auta je preciachovaný na dpi.', 456, 3.14, 35),
	(7977, 'Prečo kradnem softvér? Pretože nekradnem...', 46, 3.04, 35),
	(7978, 'Počítačového maniaka zrazí auto. On sa postaví a povie:\r\n"Nevadí, mám ešte dva životy."', 97, 3.58, 35),
	(7979, 'Prečo je Bill Gates tak veľmi bohatý?\r\nPretože za chyby sa platí...', 72, 3.27, 35),
	(7980, 'Viete, podľa čoho zistíte, že máte na počítači Windows 95? Máte špinavý reset.', 89, 3.04, 35),
	(7981, 'Mladý počítačový génius v škole:\r\n- Pán procesor...', 59, 3.12, 35),
	(7982, 'Šepká žena programátorovi:\r\n- Drahý ja chem dieťa. \r\nOk, ľahni si, nainštalujeme...', 91, 3.13, 35),
	(7983, 'Programátori majú pánsku jazdu. Vypili sii a kecajú. Jeden sa chváli:\r\n- Minule som bol na diskotéke, zbalil som tam super babu. Peknú aj inteligentnú. Zobral som ju domov. Pokecali sme, dali sme si vínka, som ju objal, ona sa ku ma pekne pritúlila. Pobozkal som ju, ona mňa. Potom som ju posadil na klávesnicu, vyhrnul sukňu a...\r\n- Ty vole, ty máš doma počítač? No, davaj, rýchlo hovor, aký!', 413, 3.41, 35),
	(7984, 'Sme novozaložená hackerská skupina a už niekoľko týždňov vytvárame vírus, ktorý zmaže celý obsah vášho pevného disku. Pretože sa nám to zatiaľ nedarilo a nemáme odvahu začať odznova, potrebujeme vašu pomoc. Nezaberie to viac ako niekoľko minút vášho drahocenného času. Boli by ste taký láskavý a zmazali by ste si obsah vášho pevného disku?\r\nÚprimne ďakujeme za vašu spoluprácu a dovoľujeme si vás ešte poprosiť o jednu láskavosť. Rozpošlite túto správu všetkým osobám vo vašom adresári.\r\nĎakujeme a prajeme príjemný deň.', 578, 3.24, 35),
	(7985, 'Pustil som si Nortona a pozeram. Vľavo disk C:, vpravo disk C:. \r\nHovorim si, na čo sú mi dva disky C:? Tak som jeden zformátoval!', 134, 3.36, 35),
	(7986, 'Viete prečo vymysleli záložné médiá?\r\nLebo vymysleli Windows.', 67, 3.31, 35),
	(7987, 'Chlap si pofajčieva cigaretu a vyfukuje obláčiky dymu. Jeho priateľka sa naštve a vraví mu:\r\n- Nevidíš, že je na krabičke napísané varovanie, že to škodí zdraviu! \r\nA on na to: \r\n- Láska, ja som programátor. Nás nezaujimajú warningy, ale len errory...', 270, 2.84, 35),
	(7988, 'Učiteľka v škole:\r\n- Jano, tvoja závislosť na počítači už nemá hraníc. Budem musieť napísať tvojim rodičom list. Povedz mi vašu adresu!\r\n- www.mrkvička.sk', 171, 3.55, 35),
	(7989, 'Potká se Motorola s Pentiem. Motorola se ptá:\r\n"Pentium kolik je jedna plus jedna?"\r\nPentium odpoví:\r\n"Tři."\r\nMotorola na to říká:\r\n"Ale Pentium to je špatně."\r\nPentium na to odpoví:\r\n"To je jedno, hlavně že je to rychle!"', 234, 3.2, 35),
	(7990, 'Čo majú spoločné pevný disk a minisukňa?\r\nKrátku prístupovú dobu.', 74, 3.23, 35),
	(7991, 'Vypol sa mi počítač - volám systémového administrátora. Prichádza administrátor, ťažko povzdychuje, volačo si tam hundre pod nos, asi 10 krát otáča moju stoličku, kope do počítača a ten sa zapína. Znova si ťažko povzdychuje, stále hundre, odchádza. On je proste šaman!\n\r\nDruhá strana:\r\nZavolali ma k užívateľovi. Ten idiot sa toľko točil na stoličke, že sa mu na ňu namotal kábel zo zástrčky. Ticho nadávam, rozmotávam kábel, odkopávam počítač čo najďalej pod stôl, zapínam ho, nadávam, odchádzam.', 547, 4.1, 35),
	(7992, 'Mama, mama! A je to pravda, že keď sa program odinštaluje, ide potom do nebeského počítača a tam funguje bez jediného zatuhnutia?', 137, 3.13, 35),
	(7993, 'Přijde věřící k faráři se spovědí a farář se ho zeptá:\r\n"Tak kolik toho je můj synu."\r\n"No, vešlo se to na dvě diskety."', 135, 3.22, 35),
	(7995, 'Viete, ako skušajú informatici mikrofón?\r\nJedna, jedna, nula, jedna...', 73, 2.96, 35),
	(7996, '- Drahý ja chcem dieťa... - šepká manželka programátorovi.\r\n- OK, ľahni si, nainštalujeme.', 98, 2.92, 35),
	(7997, 'Je jedno čo robíte, aj tak prídete o svoje dáta.', 52, 2.89, 35),
	(7998, 'Aký je rozdiel medzi Windows a vírusom?\r\nVírus je malý a niečo robí.', 74, 3.07, 35),
	(7999, 'Z histórie: \r\nPôvodnú hru od Microsoftu, nervy drásajúcu adventúru The SystemFall, pred oficiálnym vydaním programátori premenovali na Windows.', 152, 3.09, 35),
	(8000, 'Programátor sedí za počítačom, zrazu sa otvoria dvere a vojde Smrť s kosou, ale taká maličká, tri a pol palcova. Úbožiak vstane celý vystrašený:\r\n"Ja chcem ešte žiť!"\r\n"Klídek! Nejdem za tebou. "\r\n"Idem za tvojim harddiskom."', 243, 3.1, 35),
	(8001, 'Traja počítačoví maniaci sa rozprávajú a jeden hovorí:\r\n- Mňa už nebaví sa rozprávať len o počítačoch! Poďme radšej hovoriť o pekných riťkách.\r\nNastalo ticho. V tom jeden začne:\r\n- Viete, ten môj počítač je ale riadna riť!', 249, 3.16, 35),
	(8002, 'Oci, čo to znamená: Formátujem disk C:', 41, 3.13, 35),
	(8003, 'Bola v našom hlavnom meste "Výstava najmodernejšej americkej výpočtovej techniky". Predvádzač hrdo vysvetľuje:\r\n- Toto je najmodernejší model amerického počítača. Dokáže porozumieť hovorovej ľudskej reči. Splní akékoľvek želanie, ktoré vyslovíte.\r\n- Môžem to vyskúšať? - pýta sa Fero.\r\n- Samozrejme, pane. Poďte bližšie a hovorte.\r\n- Formát cé, dvojbodka enter.', 397, 3.54, 35),
	(8004, 'Príde jeden programátor celý zničený do baru a nervózne treskne do pultu. Ostatný sa ho pýtajú:\r\n- Čo sa stalo?\r\n- Ale... celý týždeň som programoval jeden zaujimavý program.\r\n- A čo? Vyšiel ti?\r\n- Ale áno, ale celú noc som prespal na klávese BACKSPACE!', 273, 3.08, 35),
	(8005, 'Programátor na vojenskom cvičení. Na ostrých streľbách páli do terča ako divý, ale od terčov hlásia, že ani jeden zásah. Tak programátor strči palec do hlavne, vypáli a rana mu pochopiteľne urve palec. Kričí k cieľom:\r\n"Hej, odo mňa to ide dobre, chyba musí byť niekde u vás!"', 300, 3.07, 35),
	(8006, 'Ineťák prišiel k voľbám. Dostal voličské lístky. Dlho ich obracal v rukách, potom sa vrátil k stolíku:\r\n"Prosím vás, a kde sa tu má klikať?"', 155, 2.92, 35),
	(8007, '"Včera mi volala manželka do práce a zobral to modem."\r\n"No a čo?"\r\n"Jak, no a čo? Pol druha hodiny spolu klebetili!"', 122, 3.21, 35),
	(8008, 'Programátor v kostole:\r\n"V mene Otca i Syna i Ducha svätého. Enter."', 71, 3.24, 35),
	(8009, 'Stretnú sa dvaja programátori:\r\n"Čože si taký smutný?"\r\n"Ále, stále mi to visí."\r\n"A troma prstami si skúšal?"', 121, 2.71, 35),
	(8010, 'Ide programátor po ulici a uvidí kolegu, ako si to mastí na novom Porsche. Zamáva naňho, auto zastane a ten bez auta sa pýta toho s autom:\r\n- Ci pána, to odkiaľ máš taky parník?\r\n- Ále. To som si debuggerom exportol z nového Need For Speedu.', 254, 3.02, 35),
	(8011, 'Čo musí urobiť sysop, keď nabalí novú kočku?\r\nDohodnúť session password.', 81, 2.55, 35),
	(8012, 'Stretnú sa v pekle dvaja čerti.\r\n"Čo si taký smutný?"\r\n"Ale, mám pracovné problémy. Robím teraz na príjme, a veľké starosti nám robia prográmatori."\r\n"A aké starosti?"\r\n"Ale, napríklad včera nám jeden zlikvidoval polovičku oddelenia motorovou pílou, než sa nám podarilo mu vysvetliť, ze to nie je dalši level DOOMu."', 340, 3.17, 35),
	(8013, 'Všetci mi hovoria, že meno kocúra sa ako heslo pre roota nehodí. Ale keď ja som si tak privykol na môjho qzb!7kw_2et !', 124, 2.85, 35),
	(8014, 'Zomrie programátor a dostane sa do pekla. Po týždni Lucifer volá Bohovi: \r\n- Čo za blázna si mi sem poslal? Zničil mi všetky kotly, poškrtil všetkých čertov a už tri dni bezhlavo behá po všetkých chodbách pekla a reve "Kde je prechod do druhého levelu?"', 271, 3.54, 35),
	(8015, 'Do firmy prišla pracovať nová Myš. Cez prestávku si šepka s Klávesnicou:\r\n"Počúvaj, Kláva, kto je tu vlastne najväčší šéf? Je ich toľko, že sa stále neviem zorientovať."\r\n"Skús si niekoho tipnúť."\r\n"Hádam Server?"\r\n"Ale kdeže! To je náš človek, tiež musí makať ako my. A keď si vypije, je výborný do party."\r\n"Tak kto teda?"\r\n"Tam sa podívaj, leží si, pomrkáva červenými očkami. Modem."\r\n"Fakt? A prečo? On je zo všetkých najmúdrejší?"\r\n"Kdeže! Blbec to je! Ale má také konexie."', 529, 3.38, 35),
	(8016, '- Oci, oci, nemôžem do počítaca založiť tretiu inštalačku!\r\n- Tú predtým si vybrala?\r\n- Keď tak o tom hovoríš, spomínam si, že už druhá tam išla nejak ťažko.', 177, 3.2, 35),
	(8017, 'Oficiálne vyhlásenie firmy Microsoft:\r\nKvôli drobným technickým problémom sa termín vydania nového operačného systému Windows 2000 odsúva na prvý kvartál roku 1901.', 178, 3.26, 35),
	(8018, 'Programátorsky:\r\n"Moja babka má dnes 64 rokov."\r\n"Že gratulujem! Také okrúhle výročie!"', 94, 3.08, 35),
	(8019, 'Vo firme sa koná maškarný ples:\r\n- Práve prichádza Milan z výstupnej kontroly v maske vlka. A za ním je Peter z obchodného oddelenia v maske medveďa. A tamto je Anička zo mzdového v maske líšky. A tam vzadu je náš správca siete Ivan v maske 255.255.255.0', 270, 3.06, 35),
	(8020, 'Doktor sa díva na faktúru za inštaláciu počítačovej siete:\r\n"Človeče, veď vy si počítate na hodinu ďaleko viac, než my!"\r\n"To je normálne. Vy doktori vystačíte so znalosťou jediného systému celý život, ale my sa musíme každy rok učit nejaký nový systém."', 282, 2.88, 35),
	(8021, 'Život by bol jednoduchší, keby sme k nemu mali zdrojový kód.', 65, 3.04, 35),
	(8022, 'Ak sa vám neukáže obraz na monitore, použite prachovku. Ak ani to nepomôže, zapnite aj počítač.', 104, 3.65, 35),
	(8023, 'Prijímacie skúšky na programátora:\r\n- Môžete vymenovať niekoľko príkazov vášho obľúbeného programovacieho jazyka?\r\n- Left, right, up, down, fire!', 159, 2.99, 35),
	(8024, 'Viete, ako sa povie Linux po španielsky?\r\nAdios BIOS.', 54, 2.8, 35),
	(8025, 'Hovorí programátor programátorovi:\r\n- Počuj, potrebujem generátor náhodných čísel.\r\n- Štrnásť.', 106, 3.01, 35),
	(8026, 'Ide programátor o 18.00 z práce a stretne šéfa, ktorý sa ho pýta: \r\n- Čo ty tak zavčasu? Zobral si si pol dňa dovolenky? \r\n- Nie, len si skočím na obed.', 163, 3.12, 35),
	(8027, 'Viete ako sa prežehnáva počítačový fanatik?\r\nV mene otca i syna, i ducha enter.', 85, 3.04, 35),
	(8028, 'Čo znamená názov systému WINDOWS? Nenechajte sa oblafnúť, že Microsoftu ide o nejaké okná. V skutočnosti ide o akronym z posledných slov indiánskeho náčelníka sediaceho býka, ktoré povedal vo svojom rodnom siouxskom nárečí. V slovenskom preklade veštba znie:\r\n"Zvíťazí Biely Muž Čumiaci Na Presýpacie Hodiny!"', 336, 3.27, 35),
	(8029, 'Stretnú sa dvaja povaľači. Prvý sa tak zamyslí a  vraví:\r\n- Človeče, keby nebol ten INTERNET, sedel by som celý deň pri telke!', 136, 3.08, 35),
	(8030, 'Otázka na rádio Jerevan:\r\nAko najjednoduchšie a najrýchlejšie odpojím klávesnicu od počítača?\r\nOdpoveď: \r\nPôjdete do nortonu, napíšete crush a odenterujete 10 kilovým kladivom...', 193, 3.11, 35),
	(8031, 'Čo je výnimočné na Windows 9x?\r\nMrznú aj v lete.', 53, 3.14, 35),
	(8032, 'Viete, čo robí Bill Gates, keď nemôže zaspať?\r\nPočíta chyby vo Windovsoch.', 82, 3.01, 35),
	(8033, 'Windows 9x sú ako puberťák.\r\nMajú problémy samé so sebou...', 65, 3.05, 35),
	(8034, 'Kto je to generál Failure a prečo číta môj drive A: ?', 58, 3.1, 35),
	(8035, 'Viete, aka je vysnívaná partnerka počítačového maniaka? \r\nTá, ktorá vie hrať po sieti Counter-strike.', 110, 2.54, 35),
	(8036, 'Kto je počítačový maniak?\r\nTen, kto sa v noci cestou na záchod najprv pozrie, či mu nedošiel e-mail. Cestou zo záchodu do postele sa pozrie ešte raz.', 158, 2.79, 35),
	(8037, 'Ako zistite že na PC je inštalovaný Windows?\r\nJe špinavý RESETový gombík.', 80, 3.2, 35),
	(8048, 'Príde veriaci na spoveď a farár sa ho spýta:\r\n”Tak, koľko je toho, synu?”\r\n”No, vošlo sa to na dve diskety.”              ', 136, 3.43, 35),
	(8049, 'Rozprávajú sa dva počítače:\r\n”Počul si ten nový vtip? 00010001010002”\r\n”Hahaha.”\n', 96, 2.43, 35),
	(8050, 'Bill Gates sa postaví pred zrkadlo a pýta sa:\r\n”Zrkadielko, povedzže mi, kto je najbohatší na svete?”\r\nNa zrkadle sa objaví modrá tabuľka: ’Program MIRROR previedol neplatnú operáciu a bude ukončený.’               ', 235, 3.72, 35),
	(8051, 'Do firmy prišla pracovať nová Myš. Cez prestávku si šepká s Klávesnicou:\r\n”Počúvaj, Kláva, kto je tu vlastne najväčší šéf? Je ich toľko, že sa stále neviem zorientovať.”\r\n”Skús si niekoho tipnúť.”\r\n”Hádam Server?”\r\n”Ale kdeže! To je náš človek, tiež musí makať ako my. A keď si vypije, je výborný do partie.”\r\n”Tak kto teda?”\r\n”Tam sa pozri, leží si, pomrkáva červenými očkami - Modem.”\r\n”Fakt? A prečo? On je zo všetkých najmúdrejší?”\r\n”Kdeže! Blbec to je! Ale má také konexie.”              ', 575, 2.55, 35),
	(8052, 'Nemám ťa rada, lebo do mňa mlátiš, ohmatávaš ma a ja som potom celá špinavá. \r\nTvoja klavesnica              ', 119, 3.14, 35),
	(8053, 'Formátuje sa pevný disk.....              ', 44, 2.29, 35),
	(8054, 'Náhrobný kameň programátora:\r\nPríčina smrti: Run Time Error at 18:30:04\r\nPríčina narodenia General Protection Fault at 16:20:35\n', 136, 3.8, 35),
	(8055, 'Závislák sedí pred počítačom a odrazu sa strhne:\r\n"Sakra, veď ja som celkom závislý na Internete..."\r\nChvíľu premýšľa, potom otvorí nové okno v browseri a hovorí si:\r\n"Ale, dakde tu proti tomu predsa musí niečo byť!"              ', 250, 3.68, 35),
	(8056, 'Viete, prečo je Pentium o poznanie rýchlejšie než 486ka??\r\nNo pretože 486ka výsledky pracne počíta, zatiaľ čo Pentium ich háda.\n', 139, 3.33, 35),
	(8057, 'Prečo Intel nepoužil pre Pentium názov 586?\r\nPretože na prvom Pentiu sčítali 486 a 100 a vyšlo im 585,999983605.\n', 120, 3.33, 35),
	(8058, 'Viete, aký je rozdiel medzi jablkami a Windows?\r\nJablka padajú len na jeseň.\n', 80, 3.63, 35),
	(8059, 'Stretli sa dvaja čerti. Jeden sa pýta:\r\n"Čo si taký smutný?"\r\n"Ale, pracovné problémy. Robím na príjme a programátori nám robia starosti..."\r\n"Aké starosti?"\r\n"Napríklad včera: Jeden nám zlikvidoval polovicu oddelenia motorovou pílou, než sa nám podarilo vysvetliť mu, že to nie je ďalší level DOOMu."\n', 325, 3.6, 35),
	(8060, 'Vite, ako spoznáte, že ste závislí na internete?\r\nKeď narazíte autom do zvodidiel, prvé, čo hľadáte, je tlačítko \'Back\'!\n', 133, 3.82, 35),
	(8061, 'Na akom hardware najlepšie beží Windows? \r\nNa diaprojektore.              ', 77, 2.82, 35),
	(8062, 'Príde ineťák k voľbám a dostane hlasovací lístok. Dlho ho obracia v rukách a potom sa opýta: \r\n"A kde sa tu má klikať?"\n', 131, 3.17, 35),
	(8063, 'Jeden mladý muž hovorí:\r\n- Chcem byť veľkým spisovateľom.\r\nPýtajú sa ho:\r\n- A čo pre teba znamená veľký?\r\n- To znamená, že chcem písať niečo, čo bude čítať celý svet, niečo, čo prinúti ľudí jednať emocionálne, niečo, čo ich prinúti jačať, kričať, šalieť a revať od zlosti, zúfalstva a bolesti!\r\nTeraz pracuje pre Microsoft a píše chybové správy.\n', 391, 3.18, 35),
	(8064, 'Príde programátor ku kamarátovi, tiež programátorovi a hneď vo dverách vidí, že chudák sedí pri stole, všetky prsty na klávesnici a nohou skúša vytiahnuť šnúru zo zásuvky. Pýta sa ho:\r\n- Čo sa deje? Čo robíš?\r\n- Ale, stiahol som si nejaký program a keď som ho spustil, tak mi vypísalo: \r\n“Stlač súčasne desať ľubvoľných kláves a uvidíš super obrázky žien”.\r\nTak som tie klávesy stlačil a objavilo sa: \r\n“Teraz pusť jedinú z nich a sformátujem ti disky”.\n', 506, 3.25, 35),
	(8065, 'Z hotline:\r\nVolá užívateľ, že sa mu nedá do mechaniky vložiť tretia inštalačná disketa. Technik sa po dlhšom premýšľaní pýta:\r\n- Počujte, a vybrali ste vôbec tú druhú?\r\n- Nie. A to mi pripomína, že tá tam išla už tiež nejako ťažko...\n', 263, 3.43, 35),
	(8066, 'Programátor je na vojenskom cvičení. Na ostrých streľbách páli do terča ako divý, ale od terčov hlásia, že sa mu nepodaril ani jeden zásah. Programátor strčí palec do hlavne, vystrelí, rana mu pochopiteľne prst odtrhne. Kričí k cieľom:\r\n- Hej, odo mňa to ide dobre, chyba musí byť niekde u vás!\n', 320, 3.61, 35),
	(8067, 'Programátor sedí za počítačom, zrazu sa otvoria dvere a vojde Smrť s kosou, ale len taká malička, tri a pol palcová. Úbožiak vstane celý vystrašený:\r\n“Ja chcem ešte žiť!“\r\nSmrť naňho ani poriadne nepozrie:\r\n“Klídek! Nejdem za tebou. Idem za tvojím harddiskom.”\n', 290, 2.88, 35),
	(8068, 'Volá čert z oddelenia kotlov čertovi na oddelenie príjmov. Chvíľu spolu rozprávajú, potom sa pýta ten z oddelenia kotlov:\r\n"Počúvaj, máš nejaký smutný hlas, čo sa ti stalo?"\r\n"Ale vieš", odpovedá ten z oddelenia príjmov, "budeme tu mať masový pohreb. Včera sme prijímali jedného počítačového maniaka, a kým sme mu stihli vysvetliť, že toto tu nie je nový level DOOMU, tak nám s motorovou pílou vyvraždil polovicu oddelenia."              ', 473, 3.73, 35),
	(8069, 'Pustil som si Norton a vidím, vľavo disk C, vpravo disk C. Vravím si: "Na čo mi budú dva disky C? Tak som ten jeden sformátoval."              ', 149, 1.72, 35),
	(8070, '"Haló, hot line? Nám to stále píše, aby sme vložili disketu, čo máme robiť?"\r\n"A vložili ste disketu?"\r\n"Nie, to nás nenapadlo."              ', 153, 3.3, 35),
	(8071, '"To sme radi, že sme sa k vám dovolali. Nám program stále píše, že nemáme zapnutú tlačiareň. Čo s tým máme robiť?\r\n"A máte ju zapnutú?"\r\n"No, nemáme."              ', 182, 3.44, 35),
	(8072, '"My to, čo píšeme do jedného počítača, nevidíme v druhom."\r\n"A máte ich zapojené v sieti?"\r\n"Áno, máme."\r\n"V akej?"\r\n"Dvestodvadsať."              ', 160, 2.86, 35),
	(8073, '"Nám to píše Insufficient memory."\r\n"To znamená, že máte málo miesta v operačnej pamati."\r\n"Nám to v ničom inom nerobí, iba vo vašom programe."\r\n"A čo iné ešte na tom počítači robíte?"\r\n"No, inak nič."              ', 235, 2.44, 35),
	(8074, '"Môžem vám nejako pomôcť?"\r\n"Áno, odlomil sa mi držiak na šálku."\r\n"Váš čo?"\r\n"No, držiak na šálku, na mojom počítači!"\r\n"Ok, slečna, môžete mi povedať, kde na vašom počítači ten držiak je?"\r\n"Viete, keď stlalčím taký malý gombík, tak vyjde von. Taká šikovná vecička. Položila som si na to veľký pohár džúsu a ono to prasklo a oblialo to mňa aj klávesnicu..."\r\n"Ach tak, zavolajte svojmu dodávateľovi a povedzte mu, nech vám opraví CD-ROM."              ', 503, 3.71, 35),
	(8075, 'Oci? čo to znamená "formátujem disk C" ?              ', 57, 3.14, 35),
	(8076, 'Prišla ráno žena do práce a zdalo sa jej, že cíti nejaký mŕtvolný zápach. Tak snorila dovtedy, kým nezistila, že pod umývadlom sa rozkladá zdochnutá myš. Sama sa jej bála dotknúť, tak sa rozhodla privolať nejakého chlapa. Bohužiaľ, jediný kto bol po ruke, bol správca siete. Žena mu teda zavolala\r\na vraví:\r\n- Haló, to si ty? Mám tu zdochnutú myš. \r\n- Tak ju dones, ja ti ju vymením.\r\n- Ty mi nerozumieš, ja myslím inú myš.\r\n- Akú inú? Na tom počítači, čo máš doma?\r\n- Nie! Z kancelárie.\r\n- To je blízko, tak prečo ju rovno nedonesieš?\r\n- Ja nemyslím takú myš! Normálnu, živú.\r\n- Kto ti má rozumieť! Tak zdochla alebo žije?\r\n- Zdochla, ale predtým žila.\r\n- Tak to sa asi poškodil prívodný kábel. Dones ju sem, dám ti druhú.\r\n- Nie! Ja mám na mysli obyčajnú myš!\r\n- Geniusku alebo Logitech?\n', 859, 3.6, 35),
	(8077, 'Zomrel Bill Gates. Príde k svätému Petrovi a ten sa ho pýta, či chce ísť do neba, alebo do pekla. Aby mal výber jednoduchší, tak mu najprv oboje ukáže. Objavili sa na nádhernej pláži, opaľujú sa tam krásne baby, hrá príjemná hudba, slniečko svieti, skrátka paráda. A svätý Peter hovorí:\r\n “Tak toto je peklo, teraz ti ukážem nebo.” A objavia sa v nejakom parku. Je tam pochmúrne, na lavičke sedia starí ľudia a kŕmia vtáčiky...\r\nSvätý Peter sa pýta: “Tak teda, kam chceš ísť?”\r\n“Tak ak je toto nebo, chcem ísť do pekla.”\r\nA Bill Gates sa objavil po krk v horúcej láve, všade vôkol plamene, síra a Bill kričí:\r\n“Kam sa podela pláž???”\r\nSvätý Peter sa otočí od svojho Macintosha a hovorí:\r\n“Tá pláž? To bolo iba demo.”               ', 812, 3.44, 35),
	(8078, 'Ide programátor po ulici a vidí pekné dievča:\r\n- Slečna, máte ICQ?\r\n- Nie<\r\n- Škoda, mohli sme sa zoznámiť.              ', 130, 2.63, 35),
	(8079, 'Sedia dvaja veľmi smutní informatici v serverovej miestnosti, príde k nim tretí a pýta sa:\r\n- a čože ste takí smutní? \r\n- no, včerá sme sa trošku ožrali a menili sme heslá.\n', 187, 3.44, 35),
	(8080, 'Pýta se jeden kamarát druhého:\r\n- už ti ta tvoja kamarátka z chatu poslala fotku? \r\n- áno ... \r\n- a čo, ako vypadá? \r\n- je taká škaredá, že se mi pri načítaní spustil antivír. \n', 193, 2.57, 35),
	(8081, 'Pýta sa syn Billa Gatesa:\r\n- Oci, chcem vyskúšať ten sex, čo mám robiť? \r\n- No synu, vezmeš si z mojej garáže to najväčšie auto, oblečieš si najlepší oblek, vezmeš dievča do najvychýtenejšej reštaurácie v meste. Po večeri vezmeš v parku kočiar s konmi a vezmeš ju na okruh okolo jazera, cestou kúpiš najväčšiu kyticu kvetov akú budú predávať a nakoniec objednáš v hoteli Plaza Prezidentský apartmán a tam sa ti dievča podvolí. \r\n- Ale otec! Kde sú romantické prechádzky, letmé dotyky, čítanie poézie za mesačného svitu, ... \r\n- Synu, to si vymysleli linuxáci aby mohli súložiť zadarmo.              ', 654, 3.78, 35),
	(8082, 'Kto je najdôležitejší v sieti?\r\nModem. Nie je najmúdrejší, ale má obrovské konexie!              ', 106, 2.7, 35),
	(8083, 'Bill Gates sa postaví pred zrkadlo a pýta sa:\r\n”Zrkadlo, kto je najbohatší na svete?”\r\nZrkadlo zmodrie a objaví sa na ňom:\r\n*Aplikácia Zrkadlo vykonala neplatnú operáciu a bude ukončená*              ', 215, 2.86, 35),
	(8084, 'Viete, aký je rozdiel medzi hardwarom a softwarom?\r\nHardware sa dá ťažšie skopírovať.              ', 106, 2.9, 35),
	(8085, 'Zákazník v predajni počítačov:\r\n”Hľadám napínavú dobrodružnú hru na PC, ktorá pre mňa bude predstavovať ozajstnú výzvu.”\r\nPredavač:\r\n”Tak to predsa skúste Windows - budete nadšený.”              ', 223, 3.31, 35),
	(8086, '”Tatko, potreboval by som nový hardisk.”\r\n”A kúzelné slovíčko?”\r\n”Do riti! Všetko je dnes zaheslované!”              ', 136, 3.71, 35),
	(8087, 'Ahoj, ako si na tom s časom cez Vianoce? Lebo súrne potrebujem zohnať somára do betlehemu.              ', 108, 2.73, 35),
	(8088, 'Vážená redakcia,\r\n\nvlani som upgradeoval Priateľku 1.0 na verziu Manželka 1.0. Vôbec sa to však neoplatilo. Nový program nečakane spustil aplikáciu deti s mimoriadne veľkou spotrebou pamäti a systémových zdrojov. V manuále nie je táto funkcia vôbec opísaná. Okrem toho Manželka 1.0 zasahuje do ostatných programov a rozťahuje sa už pri bootovaní systému. Ostatné programy, ako napríklad Nočný poker 10.3 a Pivo 2.5, Zdravotný futbal 3.5 mi prestali fungovať. Len čo ich spustím, systém sa zrúti. Navyše sa zdá, že Manželka 1.0 sa už zo systému nedá odstrániť.\r\n\nUvažoval som o návrate k Priateľke 1.0., ale uninstall skončil neúspešne.\r\nMôžete mi poradiť?\r\n\nVážený užívateľ,\r\n\nnie ste jediný postihnutý. Toto je veľmi častý problém. Mnoho ľudí naivne prechádza z funkcie Priateľka 1.0 na funkciu Manželka 1.0, pričom sa domnievajú, že je to neškodná zábavná utilitka. Lenže Manželka 1.0 je operačný systém, ktorý bol navrhnutý tak, že je schopný spúšťať sám rôzne iné aplikácie. Bez značných skúseností je nebezpečné, púšťať sa sám do inštalácie. Dodatočné odstránenie Manželky 1.0 má za následok poškodenie systémových zdrojov. Viacerí, ktorí sa o to pokúsili, mali pri tom viac problémov ako v pôvodnom systéme. Existuje možnosť, ktorú využívajú smelší muži, že spustia na pozadí paralelne systém Priateľka 2.0. Lenže funkcia je krátkodobá, pretože systém Manželka 1.0 veľmi rýchlo detekuje Priateľku 2.0., potom nastávajú problémy, ktoré napokon vedú k zrúteniu celého systému. Ich náprava je veľmi zložitá a vyžaduje si omnoho viac pozornosti ako upgrade Priateľky na Manželku. Výmenou pôvodného systému Manželka 1.0 na Manželka 2.0 sa nič nemení. Pravidlá ostávajú, stále hrozia komplikácie alebo zrútenie systému. Okrem toho je to veľmi drahý systém Jediná možnosť, ako sa vyhnúť problémom, je neinštalovať software Manželka, ale používať len software Priateľka. Verzie Priateľka 1.0 ,2.0,3.0 sú navzájom kompatibilné, môžu sa používať paralelne. Varujte, prosím, v tomto zmysle svojich priateľov pred neuváženým upgradeovaním. Vysvetlite im, že pri neuváženom upgrade dostanú ešte darček navyše: nedokumentovanú automatickú inštaláciu programu Svokra 6.4. Poradiť si s ním dokážu len najväčší machri.', 2431, 4.15, 35),
	(8089, 'Programátor sedí za počítačom, zrazu sa otvoria dvere a vojde Smrť s kosou, ale taká maličká, tri a pol palcová. Úbožiak vstane celý vystrašený:\r\n"Ja chcem ešte žiť!"\r\n"Nemaj strach! Nejdem za tebou. "\r\n"Idem za tvojim hardiskom."', 248, 2.93, 35),
	(8090, 'Aký je rozdiel medzi jablkami a Windows?\r\n- Jablká padajú iba na jeseň.', 75, 3.17, 35),
	(8091, 'Mladá dynamická spoločnosť hľadá hackera na plný pracovní úväzok. Svoj štruktúrovaný životopis prosím zanechajte na našom počítači STANICA1 v adresári C:\\Dokumenty\\zivotopisy.', 195, 3.65, 35),
	(8092, 'Aký je rozdiel medzi Windows a Tamagochi?\r\n- Windows zdochne aj keď sa oň staráte.', 86, 3.15, 35),
	(8093, 'Zákazník: "Mám nainštalovaný Windows 98."\r\nHotline : "OK."\r\nZákazník: "Počítač mi nefunguje."\r\nHotline : "Áno, to ste už hovorili..."', 145, 3.69, 35),
	(8094, 'Čo majú spoločné minisukne a pevné disky???\r\nKrátky prístupový čas.\r\n', 78, 3.69, 35),
	(8095, 'Programátorova žena vraví svojmu mužovi:\r\n- Drahý, chcela by som dieťa.\r\n- Tak dobre, nainštalujeme...', 109, 3.7, 35),
	(8096, 'Viete, čo vznikne spojením OS Windows Ce, Windows Me a Windows NT?\r\nNo predsa Windows Cement. ', 96, 3.47, 35),
	(8097, 'CHVÍĽKA POÉZIE\r\nZamrzol mi počítač,\r\nstal sa zo mňa agresor.\r\nCelý som ho rozmlátil,\r\nvytrhol mu procesor.', 115, 3.43, 35),
	(8098, 'Aké sú najčastejšie používané klávesy Windowsu?\r\n- No predsa Ctrl + Alt + Del', 85, 3.36, 35),
	(8099, 'Čo sa nedá stiahnuť cez internet? Moje nohavičky!', 53, 3.43, 35),
	(8100, 'Webmaster vypľnuje dotazník:\r\nvek: 25\r\nvýška: 185\r\nfarba očí: #4040FF', 75, 3.59, 35),
	(8101, 'Príde unavený a nahnevaný programátor do práce. Kolegovia sa ho pýtajú: "Prečo si taký naštvaný?"\r\n- "Ále, robil som jeden program."\r\n- "A čo, nefungoval?"\r\n- "Nie, fungoval perfektne.."\r\n- "Tak čo sa stalo?"\r\n- "Zaspal som na BackSpace...."', 255, 3.62, 35),
	(8102, 'Ležia tri krabice od softvéru na smetisku:\r\n"Prečo si tu?"\r\n"Nebežal som pod Windows 98, a ty?"\r\n"Ja som padal pod Windows 98, a ty, tretia?"\r\n"Ja som Windows 98..." ', 170, 3.23, 35),
	(8103, 'Sedia dvaja veľmi smutní informatici v serverovni, príde k nim tretí a pýta sa:\r\n- A čože ste takí smutní?\r\n- No... včera sme sa trošku ožrali a menili sme heslá... ', 178, 3.05, 35),
	(8104, 'Príde veriaci do kostola na spoveď a farár sa pýta:\r\n- Tak, synku, koľko je toho tentoraz?\r\n- Ani nie tak veľa. Vošlo sa to na dve diskety...\r\n\n\n', 152, 3.65, 35),
	(8105, 'Dvaja programátori v bare. Prechádza okolo nádherná žena a jeden si vzdychne:\r\n- Bože, tá má properties!\r\n- Read only, - odpovedá druhý, - Včera som to testoval...', 174, 3.29, 35),
	(8106, 'Viete ako sa prežehnáva závislák od počítačových hier?\r\nW S A D \r\nEnter', 79, 3.63, 35),
	(8107, 'Zákazník: "Mám nainštalovaný windows."\r\nHotline: "Áno."\r\nZákazník: "Počítač nefunguje."\r\nHotline: "Áno, to ste už hovorili."', 137, 2.54, 35),
	(8108, 'Bez uloženia dokumentu system Windows nemôže uložiť dokument. Prosím, uložte dokument.', 93, 3.24, 35),
	(8109, 'Prehnal si to s cs-kom:\r\n\n1. Opustíš byt iba cez vetraciu šachtu.\r\n\n2. Nevstúpiš do bytu skôr, než tam hodíš flashbang.\r\n\n3. Pri každom kliknutí, ktoré počuješ sa schováš, pretože by to mohol byť sniper.\r\n\n4. Každý, kto sa zdrží na verejných záchodoch viac ako minútu je označený ako camper.\r\n\n5. Keď sa zobudíš, snažíš sa kúpiťt zbrane.\r\n\n6. Zomrieš asi 20-krát za deň.\r\n\n7. V práci alebo v škole hovoríš len o zbraniach.\r\n\n8. Keď ideš ráno z domu, vyrazíš so slovami "go go go".\r\n\n9. Vždy, keď sa stretneš so šéfom, povieš "Enemy Spotted".\r\n\n10. Keď spanikáriš, bežíš s nožom v ruke.\r\n\n11. Keď odhodíš špak z cigarety, automaticky zakričíš "fire in the hole!".\r\n\n12. Keď čakáš na autobus, stojíš za, pod alebo nad zastávkou.\r\n\n13. Ideš do práce s helmou a nepriestrelnou vestou.\r\n\n14. U červeného kríža pokladáš bombu.\r\n\n15. Po každom napísanom odstavci vymeníš bombičku v pere.\r\n\n16. Keď ideš za roh, zakričíš "Storm the Front!".\r\n\n17. Skočíš z 5 metrovej výšky, pretože by trvalo dlho prejsť a myslíš, že ostatok dna prežiješ i s 40% zdravím.\r\n\n18. Keď uvidíš nákupný vozík, hľadáš klávesnicu a písmeno "B", ako by si sa chcel dostať do BUY MENU.\r\n\n19. Keď chceš vyvetrať, rozstrelíš okno a divíš sa, že črepiny zostávajú i po dlhšej dobe ležať na zemi.\r\n\n20. Keď ti ráno začne zvoniť budík, zúfalo hľadáš Defusion Pack.\r\n\n...ak sa ti zdá, že máš rovnaké problémy, prosím kontaktuj svojho lekára!!!', 1550, 3.17, 35),
	(8110, '- Viete čím je zaujímavý Windows?\r\n- Že zamŕza aj v lete.', 63, 3.85, 35),
	(8111, 'Prijímacie skúšky na škole pre policajtov. Prvá otázka:\r\n- Ako sa voláte?\r\nVšetci mlčia. Druhá otázka:\r\n- Koľko je tri plus tri?\r\nZas všetci mlčia. Tretia otázka:\r\n- Akej farby je táto zelená kniha?\r\nZo zadného radu sa ozve:\r\n- Do čerta! Ten nás chce hádam zničiť!', 287, 3.53, 36),
	(8112, 'Policajný záznam: Obeť bola dostrieľaná 12 bodnými ranami, ktoré spôsobili popáleniny 3 stupňa richtárovej stupnice.', 127, 3.55, 36),
	(8113, 'Jeden policajt hovorí druhému:\r\n- Ty, neuveríš, čo som včera videl. Slepý chlap si čítal časopis.\r\n- Ale nevrav, určite si iba pozeral obrázky.', 155, 3.58, 36),
	(8114, 'Hovorí policajt policajtovi:\r\n-Včera som si kúpil záchodovú kefu.\r\n-No a? Aká je?\r\n-Toaletný papier bol lepší!', 119, 3.49, 36),
	(8115, 'Policajt pri práci so skrutkovačom nešťastnou náhodou príde o jedno oko. Po vyliečení dostane od svojej poisťovne 8.000 Sk. Celý natešený hovorí manželke:\r\n- Vieš ty čo? Mám nápad! Vypichnem si aj druhé oko a kúpime si farebný televízor.', 259, 3.97, 36),
	(8116, 'Skúšobný komisár policajtov zadáva otázku:\r\n- Po moste idú dva kone, čierny a biely. Prvý zíde z mosta čierny. Otázka pre vás: "Ktorý kôň zostal na moste?" No?\r\nV tom sa z kúta ozve nesmelý pokus o odpoveď: \r\n- Žeby čierny?', 244, 2.65, 36),
	(8117, 'Policajný náčelník sa pýta svojho podriadeného:\r\n- Ako dopadli testy na Americkú Akadémiu?\r\n- Bolo šesť testov. Z troch testov som mal päťku a z troch testov som mal jednotku, takže ma prijali.  \r\n- A z čoho si mal päťku a z čoho jednotku?\r\n- Päťku som mal z vyšetrovania, streľby a písania. A jednotku: krv, moč, stolica.', 345, 3.78, 36),
	(8118, 'Prečo má policajt v spálni jamu? \r\nNo preto, aby mal hlboký spánok.', 72, 3.04, 36),
	(8119, 'Prečo sa policajt usmieva, keď sa blíska.\r\nLebo si myslí, že ho fotia.', 75, 3.69, 36),
	(8120, 'Policajt nájde na zemi zrkadielko:\r\n"Aha, našiel som fotografiu".\r\nPozrie sa na ňu a prekvapene vykríkne:\r\n"A je dokonca moja."', 131, 3.39, 36),
	(8121, 'Dvaja policajti naháňajú zlodeja, ktorý im ušiel v paneláku po schodoch.\r\nOni sú samozrejme chytrejší a tak jeden druhému povie, aby zavolal výťah.\r\nDruhý policajt kričí: \r\n"Výýýýýťah, poď sem!"\r\n"Ale to nemôžeš tak, to sa musí prstom", hovorí mu druhý.\r\n"Aháá", rozumne prikývne, otrčí ruku hore, kývne prstom a hovorí: "No tak výťah, poď sem."', 383, 3.54, 36),
	(8122, 'Na policajnej stanici. Šéf sa pýta:\r\n- Rozumie tu niekto elektrotechnike?\r\nJeden policajt sa ozve:\r\n- Ja!\r\n- Dobre, tak vypni túto lampu!', 141, 3.74, 36),
	(8123, 'Dvaja policajti prišli na pohreb bývalému kolegovi. Všetci hádžu do hrobu kytice kvetov a zrazu sa ozve buchnutie o rakvu. Prvý policajt sa otočí ku kolegovi: \r\n"Čo to bolo?"\r\n"Nemali kvety, tak som kúpil dezert."', 224, 3.32, 36),
	(8124, 'V kine policajt policajtovi:\r\n- Teraz sa príprav! Príde happy end!\r\n- Jaj, len aby si nesadol pred nás!', 106, 3.12, 36),
	(8125, 'Viete koľko existuje vtipov o policajtoch?\r\nAni jeden - všetko je pravda!', 75, 3.4, 36),
	(8126, 'V roku 1820 zabudovali na policajnú stanicu prvé WC. V roku 1879 ho zmodernizovali a do misy vyrezali otvor.', 110, 3.33, 36),
	(8127, 'Policajt: \r\n"Keď robili nábor, hovorili, že podmienkou je maturita. Máte ho vidieť, samá výnimka, všelijaké policajtské pármesačné kurzy. Ja jediný mám maturitu z päťročného stavebného učilišťa. Potom to tak aj vyzerá. Napríklad, mali sme pohreb kolegu, čo zahynul pri výkone služby. Krásny pohreb, salva, dychovka. Ale to ste mali vidieť. Keď začala tá dychovka hrať, všetci stáli ako také telce. Ja jediný som pozval vdovu do tanca."', 473, 3.46, 36),
	(8128, 'Policajt sa ponáhľa domov a volá manželke, aby zatiahla rolety, vliezla do postele a skryla sa pod paplón. Žena to všetko celá natešená spraví a čaká na manžela. V tom sa vrhne pod paplón manžel a skríkne:\r\n- Aha ako mi svietia nové hodinky!', 259, 3.28, 36),
	(8129, 'Stretnú sa dvaja policajti a jeden chrúme čokoládu. Druhý sa pýta: \r\n- Kde si zohnal tu čokoládu?\r\n- Tam v tom obchode za rohom.\r\n- Je tam veľa ľudí?\r\n- Ani nie, tak na pol zásobníka.', 196, 3.42, 36),
	(8130, 'Päť angličanov v Audi Quatre príde na taliansku hranicu. Taliansky colník ich zastaví a vraví: \r\n- To je proti predpisom piati v Quatre.\r\n- Čo tým myslíte proti predpisom?\r\n- Quatro znamená štyri - vysvetľuje colník.\r\n- Quatro je iba názov auta! - hovorí už mierne nasratý angličan.\r\n- Pozrite sa do papierov - je to auto pre päť osôb.\r\n- To mi nevysvetľuje, quatro znamená štyri a vy ste v aute piati. Porušili ste teda zákon.\r\nAngličan kričí: \r\n- Zavolajte mi vášho nadriadeného, chcem hovoriť s niekým kto má viacej inteligencie!\r\n- Prepáčte, nomôže prísť, je práve zaneprázdnený s tromi pánmi vo Fiate Uno.', 656, 3.81, 36),
	(8131, 'Prečo sa policajti stále otierajú o stenu?\r\nAby boli drsní chlapi.\n\r\nA prečo so sebou nosia motorovú pílu?\r\nAby mohli lepšie rezat zákruty.', 148, 3.27, 36),
	(8132, 'Ide policajt po ulici a vidí na zemi zrkadielko. Zdvihne ho, zľakne sa a uteká na strážnicu. Vojde do kancelárie šéfa a kričí:\r\n"Pozrite, našiel som fotku hľadaného zločinca!"\r\nŠéf si ho zoberie, pozrie doňho a hovorí:\r\n"Toho poznám, to je ten škaredý, ale veľmi nebezpečný zločinec. Ideme ho hľadať."\r\nDá si zrkadielko do kabátu a idú hľadať. Hľadajú celý deň a každému ukazujú zrkadielko. Každý si však len ťuká na čelo a odíde preč. Večer šéf príde domov, odloží kabát aj so zrkadielkom ku botníku a ide spať. Dcéra nájde zrkadielko, pozrie doň a kričí na mamu:\r\n"Mami, mami oco ma mladú šľapku, tu je jej fotka."\r\nMama príde, pozrie a rozosmiata vraví:\r\n"Takú starú kravu mať môže."', 757, 3.69, 36),
	(8133, 'Prídu sociálni pracovníci za policajtom a hovoria mu:\r\n- Váš syn musí navštevovať špeciálnu školu.\r\nOn odpovedá s úsmevom na tvári:\r\n- Keď na to má, nech študuje.', 179, 3.18, 36),
	(8134, 'Pýta sa jeden policajt druhého: \r\n"Počuj bol si Ty už na Štrbskom Plese?"\r\n"Nie, ja chodím len na NÁŠ a na HASIČSKÝ."', 127, 3.36, 36),
	(8135, 'Policajt lúšti krížovku a pýta sa kolegov:\r\n- Chlapi, ako sa povie ženský pohlavný orgán na štyri?\r\n- A je to vodorovne alebo zvislo?\r\n- Vodorovne.\r\n- Tak to bude HUBA.', 178, 3.43, 36),
	(8136, 'Na hlavnej ceste sa stala dopravná nehoda a na miesto nehody prídu policajti. Jeden z policajtov začne zapisovať:\r\n- Jedna noha na ceste, druhá noha v priekope, ruky na kapote a hlava na poli, na poly, na poli... \r\nKopne do hlavy.\r\n- Hlava v priekope.', 256, 3.13, 36),
	(8137, 'Stretnú sa dvaja policajti a jeden druhého sa pýta: \r\n- Kam ideš s tým psom?\r\n- Ale, idem ho predať.\r\n- A koľko za neho chceš?\r\n- Tridsať tisíc.\r\n- Neblázni. Je to síce dobrý pes, ale toľko ti za neho nikto nedá!\r\n- Neveríš? Tak sa pozeraj! - a vojde do prvého domu.\r\nO päť minút sa vracia bez psa s vrecom cez plece a ten neveriaci sa ho pýta: \r\n- Neverím, že si ho predal. A dali ti tridsať tisíc?\r\n- Noo, ale kedže nemali v hotovosti, tak mi zaň dali dve mačky po päťnásťtisíc!  ', 516, 3.37, 36),
	(8138, 'Viete prečo si policajti dávajú na noc ku posteli jeden prázdny a jeden plný pohár?\r\nBuď budú smädný alebo nie!', 121, 3.02, 36),
	(8139, 'Policajt sa miluje so ženou a ona od vzrušenia strašne kričí. Policajt sa jej pýta:\r\n- Bolí?\r\n- Nie, práve naopak!\r\n- Ílob?', 132, 3.37, 36),
	(8140, 'Pri osobitnej škole je desať policajných áut. Viete prečo?\r\nBuď sú policajti na stretnutí po desiatich rokoch, alebo na rodičovskom združení. ', 153, 3.57, 36),
	(8141, 'Na policajnej stanici sa stretnú policajti. Šéf hovorí:\r\n- Stretneme sa pri hlavnom námestí o 11:48. Pre tých, ktorí majú digitálky, je to obušok, obušok, stolička, snehuliak.  ', 190, 3.42, 36),
	(8142, 'Prečo maju policajti na aute zelený pás? \r\nAby rýchlejšie našli kľučku na dverách. \r\nA prečo je ten pás po celom aute? \r\nAby to nemali také jednoduché.', 164, 3.23, 36),
	(8143, 'Koľko trvá policajtovi napísať venovanie na tortu?\r\nDve hodiny aj päť minút.\r\nPäť minút to píše a dve hodiny vyberá z písacieho stroja.', 149, 3.4, 36),
	(8144, 'Stretnú sa dvaja policajti.\r\n- Ahoj Jano, kam si sa vybral?\r\n- Idem sa lyžovať!\r\n- A prečo máš také krátke lyže?\r\n- To mi stačí, idem len na 2 dni!', 158, 3.17, 36),
	(8145, '- Pozri, kúpil som si nové poltopánky - hovorí policajt žene.\r\n- Dnes si ich ešte nemôžem obuť, až o niekoľko dní.\r\n- A to už prečo?\r\n- Predavač mi povedal, že prvé dni ma budú tlačiť.', 204, 3.15, 36),
	(8146, 'Sedí policajt na lavičke a strašme narieka. Ide okolo neho babka a tato sa ho pýta, že prečo narieka. Policajt jej hovorí:\r\n- Stratil sa mi pes. \r\nBabka sa ho opýtala, ako vyzeral. Policajt hovorí, že je hnedý, belgičák. Babka hovorí:\r\n- Ale však sa nebojte pán policajt, však on si cestu nájde. \r\n- No on áno, ale je nie.', 341, 3.22, 36),
	(8147, 'Policajt bije malého chlapca. Pristavý sa okoloidúci a opýta sa:\r\n- Prečo ho bijete, veď vám nič nespravil.\r\n- Nespravil, nespravil. Povedal, aby som pomiloval jeho psa, lebo vraj chce mať policajného...', 213, 3.27, 36),
	(8148, 'Niekto zaklope na dvere policajnej kancelárie.\r\n- Kto je to?\r\nSpoza dverí:\r\n- Ja.\r\nPolicajt sa zamyslí:\r\n- Ale veď ja som tu!', 129, 3.32, 36),
	(8149, 'Rozkaz nastúpeným policajtom pred odchodom na cvičenie :\r\n- Velitelia pôjdu autobusom a zvyšok nastúpi do vlečky. Autobus odchádza o 10.00 h.\r\nJeden z policajtov sa pýta :\r\n- A kedy prosím odchádza ta vlečka?', 220, 3.22, 36),
	(8150, 'Dvaja policajti majú hliadku na dialnici pri Devínskej Novej Vsi. Zrazu vidia záhoráka ako pred so sebou kotúľa veľký sud. Prídu k nemu a pýtajú sa:\r\n- Čo to máte?\r\n- Viete, doktor chcel aby som si priniesol týždňový moč.\r\nTak ho pustia.  Večer znovu vidia ako záhorák kotúľa sud naspäť.\r\n- A teraz nám to ako vysvetlíte?\r\n- Doktor v ňom našiel cukor. No nevypálili by ste to?', 406, 3.27, 36),
	(8151, 'Colník sa pýta vodiča autobusu:\r\n- Cigarety, alkohol, drogy?\r\n- Kávu prosím.', 81, 3.28, 36),
	(8152, 'Hovorí policajt vodičovi:\r\n"Už tretí krát vám hovorím, že vám tečie chladič!!!"\r\nVodič nato:\r\n"A ja vám už tretíkrát hovorím, že mám kropiace auto."', 167, 3, 36),
	(8153, 'Viete prečo chodia policajti vždy dvaja na obhliadku?\r\nLebo jeden pozná cestu tam a druhý cestu späť.', 107, 3.11, 36),
	(8154, 'Prečo si policajti stále myslia, že na mesiaci niekto býva?\r\nLebo sa tam svieti celú noc.', 94, 3.23, 36),
	(8155, 'Prečo policajti oblizujú svoje hodinky?\r\nLebo robia tik-tak a majú iba dve kalórie.', 87, 3.16, 36),
	(8156, 'Rozčúlený policajt vtrhne do Mototechny, nahnevane hodí na pult akýsi balíček a zreve na predavačku:\r\n- Počúvajte, minuly týždeň som si od vás kúpil odrazové sklíčka, no ako som zistil, predali ste mi akési nepodarky, nejaký šmejd!\r\n- Naozaj? - čuduje sa predavačka.\r\n- Naozaj, len raz som sa s nimi odrazil od steny garáže a už je po nich.', 366, 2.95, 36),
	(8157, 'Koľko musí slovenský policajt piť, aby dosiahol 0,5 promile alkoholu v krvi?\r\nTri dni nič.', 95, 3.53, 36),
	(8158, 'Prečo policajti nejedia uhorky?\r\nPretože sa im nezmestí hlava do flaše.', 75, 3.45, 36),
	(8159, 'Koľko policajtov je potrebné na výmenu žiarovky?\r\n16\r\nJeden drží žiarovku, 4 držia stôl a behajú s ním dookla, ďalší 10 behajú druhou stranou aby sa tým piatim nezatočila hlava a posledný stojí pri dverách a dáva pozor aby neprišiel prúd.', 261, 3.12, 36),
	(8160, 'Dvaja policajti mudrujú pred veľkou budovou, čo to asi môže byť. Nevedeli si poradiť, tak zavolali jazykovedný ústav s otázkou čo je to VATÓRIUM. Chlapík z druhej strany telefónu sa vyzvedá, skade majú toto zvláštne slovo. Policajt pohotovo odpovie:\r\n- Videli sme na jednej veľkej budove vypísané OBSERVATÓRIUM. To prvé slovo vieme čo znamená, len zaboha nevieme, na čo sa máme vysrať.', 413, 3.23, 36),
	(8161, 'Hovorí jeden policajt druhému:\r\n- Predstav si, včera som musel robiť IQ test.\r\n- A ako ti dopadol?\r\n- Výborne. Bez nálezu. ', 129, 3.24, 36),
	(8162, 'Viete prečo policajt stále otvára a zatvára flašku od Coca-Coly?\r\nLebo na vrchnáčiku je napísané "Skús to znova".', 123, 3.4, 36),
	(8163, 'Idú dvaja policajti po ZOO. Jeden z nich uvidí ťavu a vraví tomu druhému:\r\n- Kukaj tu, ako zbili koňa.', 108, 3.1, 36),
	(8164, 'Dvaja policajti sa potrebujú dostať na stanicu. \r\n- Pôjdeme peši alebo autobusom?\r\n- Čo pôjde skôr!', 106, 3.2, 36),
	(8165, 'Idú dvaja policajti po chodníku a nájdu 3 granáty. Jeden sa pýta:\r\n- Čo urobíme, keď jeden vybuchne?\r\nDruhý hovorí:\r\n- Povieme, že sme našli len dva.', 161, 3.2, 36),
	(8166, 'Prechádzajú sa dvaja policajti po Bratislave a obzerajú si nočnú oblohu. Jeden vraví:\r\n- Nezdá sa ti, že ten malý voz nejako slabo svieti?\r\n- Veru! - pritaká druhý. Mali by sme mu zobrať techničák.', 211, 3.65, 36),
	(8167, 'Sú dva druhýypolicajtov: \r\nTíi, ktorí si žijú dobre.\r\nA tí, ktorí ešte neberú úplatky.', 97, 2.98, 36),
	(8168, 'Čo znamená 15 policajných áut pred budovou školy pre mentálne postihnutých?\r\nRodičovské združenie!', 108, 3.24, 36),
	(8169, 'Policajt zastaví vodiča.\r\n- Pane, nesvieti vám pravý heligón.\r\n- Hádam halogén, nie?\r\n- Aha, tak pán je ešte aj suterén.\r\n- Hádam suverén, nie?\r\n- No tak pozor priateľu. Používať cudzie výrazy je občas rizoto.', 227, 3.47, 36),
	(8170, 'Policajný náčelník si chce vyskušať vernosť svojich podriadených.\r\nZavolá si prvého policajta. Hovorí mu:\r\n"Tam vedľa v miestnosti je Tvoja svokra, tu máš pištoľ a zastrel ju!!"\r\nPolicajt však o chvíľu vyjde von celý bledý, že to nedokáže.\r\nTak zavolá druhého policajta a poverí ho tou istou úlohou.\r\nTen však onedlho tiež vyjde von celý bledý, že to nedokáže.\r\nNakoniec ide tretí policajt dnu a zrazu počuť výstrely, potom krik, údery až nakoniec policajt vyjde von celý dotrhaný, skrvavený.\r\nNáčelník sa nesmelo pýta, že čo sa stalo.\r\n"Ale šéfe, vojdem dnu, zbadám svokru, vypálim na ňu jeden krát -nič, vypálim druhý krát - nič, pozriem na pištoľ a v tom zbadám, že mám slepé náboje.\r\nTak som ju musel dotĺcť stoličkou!!!"', 796, 3.62, 36),
	(8171, 'Rozprávajú sa dvaja potápači:\r\n"Včera som sa potápal do hĺbky 1500 metrov a zrazu vidím, americkú ponorku."\r\n"A ako to vieš?!"\r\n"Keď som prišiel bližšie,zaklopal na okno a  všetci vo vnútri mávali americkými vlajkami."\r\n"To je nič ja som sa včera potápal do 2000 metrovej hĺbky a zrazu vidím, policajná ponorka."\r\n"A ako to vieš."\r\n"Prišiel som bližšie, zaklopal a otvorili okno..."', 410, 3.37, 36),
	(8172, 'Päť Belgičanov v Audi Quattro príde na francúzsku hranicu, kde ich zastaví colník. \r\n- Quattro znamená štyri. Päť ľudí nesmie ísť v Quattre.\r\n- Veď Quattro je len značka auta - namieta vodič. Pozrite sa, v papieroch je napísané, že je určené pre päť ľudí.\r\n- Nič také na mňa neskúšajte - pokrúti hlavou colník. \r\n- Vy ste teda hlupák! - rozčúli sa vodič. Zavolajte mi svojho nadriadeného.\r\n- Teraz nemá čas - odpovie colník. Má kopu práce tamto s tými dvoma ľuďmi vo Fiate Uno.', 524, 3.18, 36),
	(8173, 'Viete prečo policajti musia mať otvorené okno keď idú do zákruty?\r\nAby mohli vyhodiť smerovku.', 101, 3.19, 36),
	(8174, 'Čo sa stane s policajtom, keď si dá viagru?\r\nPovyrastie.', 59, 2.95, 36),
	(8175, 'Policajt príde do roboty a chváli sa.\r\n- Chlapi, už viem, čo dostanem od ženy k narodeninám. Pozrel som sa do skrine a viem, že dostanem nejakého nahého chlapa.', 169, 2.93, 36),
	(8176, '- Pán vyšetrovateľ, ako ste prišli k poznatku, že obeť bola zavraždená uškrtením Kosmodiskom?\r\n- Viete, nebolo to až také ťažké: Jedine čo ho prezradí je úsmev na tvári poškodeného...', 204, 3.17, 36),
	(8177, 'Prečo policajti jazdia tak rýchlo???\r\n1. Aby nezabudli kam idú\r\n2. Aby služba rýchlejšie ubehla\r\n3. Aby najazdili čo najviac kilometrov než im dôjde benzín', 165, 3.17, 36),
	(8178, 'Prečo si policajti neumývajú zuby?\r\nPredsa preto, lebo sa im mydlo nezmestí do úst.', 88, 2.96, 36),
	(8179, 'Nákladné auto sa vklíni pod nadjazd. Príde policajt a pýta sa:\r\n- Nevmestili sme sa?\r\n- Ale nie, hovorí šofér. Ja veziem nadjazd!', 137, 3.05, 36),
	(8180, 'Pri vypočúvaní policajta:\r\n"Viete,ja som vystrelil výstražne iba dva razy do vzduchu."\r\n"A to ste museli rovno do hlavy?"', 126, 3.24, 36),
	(8181, 'Rozprávajú sa dvaja policajti na autobusovej zastávke:\r\n"Pôjdeme pešo alebo autobusom?" \r\nDruhý odpovedá:\r\n"Tým čo príde skôr!"', 138, 3.07, 36),
	(8182, 'Otázka: \r\nNa seneckých jazerách sa prevrátil čln so šiestimi policajtami. Koľko policajtov sa utopilo?\r\nOdpoveď: \r\nDvanásť. Ďalších šesť sa utopilo pri rekonštrukcii.', 182, 3.48, 36),
	(8183, 'Jeden policajt hovorí druhému:\r\n"Vieš,vždy keď prídem domov,prvé čo urobím je, že dám dole frajerkine nohavičky."\r\n"To máš takú strašnú chuť na sex?"\r\n"Nie,strašne ma režú na zadku."', 203, 3.85, 36),
	(8184, 'Blondínu zastaví policajt a hovorí:\r\n"Prosil by som si váš občiansky preukaz."\r\n"A to je čo?"\r\n"To je taká zelená kartička s vašou fotkou\r\na údajmi."\r\nBlondýna hľadá až nájde zrkadlo a povie:\r\n"Á,to bude asi ono!"\r\nPolicajt sa doňho pozrie a povie:\r\n"Ó prepáčte! Nevedel som že aj vy ste od polície!"', 324, 3.86, 36),
	(8185, 'Policajt vojde do kníhkupectva. Knihovníčka sa ho pýta:\r\n- Ale, pán policajt, vonku azda prší?', 101, 3.07, 36),
	(8186, 'Idú traja policajti a zrazu ponad nich preletia tri lietadlá. Veliteľ im hovorí:\r\n- Aha, chlapci, tryskáče.\r\nO chvíľu letia späť už iba dve lietadlá a jeden z policajtov kričí.\r\n- Veliteľ, aha, dvaskáče...', 222, 3.2, 36),
	(8187, 'Na policajnej stanici sa pokazil prah na dverách. Prišiel náčelník a povedal policajtom nech to opravia. Šli kúpiť klince a kladivo a začali zatĺkať, ale hlavičkou smerom dole. Nato príde náčelník, zoberie klinec a povie: \r\n"Ste normálny? Kúpili ste klince do stropu."', 286, 3.33, 36),
	(8188, 'Príde chlapček s obuškom k policajtovi a pýta sa: \r\n- Ujo, nie je náhodou toto váš obušok?\r\nPolicajt na neho smutne pozrie a hovorí: \r\n- Nie, ja som ten môj stratil!', 175, 3.08, 36),
	(8189, 'Je leto, policajti na ceste pristavia vodiča a vravia:\r\n- Človeče, vy ste pil?\r\n- Nie. Prečo?\r\n- Však idete teraz v lete s lyžami na streche! \r\n- Však hej, ale to sú vodné lyže!\r\nDruhý policajt hovorí:\r\n- To je OK, nie je podozrivý. Pustime ho. \r\nA chvíľku policajt rozmýšľa a vraví druhému:\r\n- Počúvaj, tak predsa bol podozrivý! \r\n- Prečo? \r\n- Však u nás v dedine sú dve jazerá a ani jedno nie je dole kopcom!', 438, 3.48, 36),
	(8190, 'Viete prečo má policajt v aute rakvu?\r\nKeby mu zdochol motor.', 63, 3.01, 36),
	(8191, 'Ako policajti otvárajú  konzervu?\r\nV mene zákona, otvor sa!', 62, 3.29, 36),
	(8192, 'Príde policajt do drogérie a pýta si jeden šampón.\r\n"Nech sa páči,ale máme iba vajíčkový."\r\n"Ďakujem,ja som chcel na vlasy."', 136, 3.31, 36),
	(8193, 'Policajt chytí zlatú rybku a tá mu vraví:\r\n- Splním ti tri želania.\r\nPolicajt nato: \r\n- Vodičský, občiansky a pas.', 123, 3.34, 36),
	(8194, 'Viete, prečo policajti musia vždy po vianociach vymeniť vaňu v kúpeľni?\r\nPretože ju pri zabíjaní kapra celú rozstrieľajú.', 133, 3.22, 36),
	(8195, 'Prečo majú slepci bielu paličku a policajti bielu čiapku?\r\nAby sme vedeli, že slepci nemajú zrak a policati nemajú rozum.', 128, 3.14, 36),
	(8196, 'Viete prečo sa policajti pred obchodom vždy poserú?\r\nLebo na dverách je napísané Tlačiť!', 96, 3.41, 36),
	(8197, 'Rozprávajú sa dvaja policajti:\r\n"Ty predstav si, že tento rok vychádza silvester na piatok!"\r\n"Nehovor! Len dúfam, že to nebude 13-teho!"', 143, 3.33, 36),
	(8198, 'Viete,čo sa hovorí,keď sa učiteľ opýta na vyučovaní do triedy nejakú otázku a zrazu zavládne hrobové ticho?\r\nŽe sa narodil ďalší policajt.', 154, 2.96, 36),
	(8199, 'Proč policajti stojí v zime v rohu pokoje?\r\nProtože tam je vždy 90 stupňú.', 80, 3.22, 36),
	(8200, 'Príde slovenský policajt do českého baru a hovorí:\r\n- Jednu whisky.\r\nA barman sa pýta:\r\n- Skotskou?\r\n- Nie, bez kocky.', 124, 3.37, 36),
	(8201, 'Prijímacie pohovory na Policajnú akadémiu prebiehajú takto:\r\nJe daný otvor trojuholníkového a otvor kruhového tvaru. Adepti dostanú dve telesá, jedno s kruhovým podstavcom a druhé s trojuholníkovým podstavcom. Majú za úlohu vsunúť teleso do správneho otvoru. Na základe výsledkov testu ich potom rezdeľujú na múdrych a silných.', 352, 3.26, 36),
	(8202, 'U náčelníka polície sa hlásia dvaja nahí policajti. Náčelník nechápe a chce vysvetlenie. Policajti teda vysvetľujú:\r\n- Boli sme na večierku, ktorý mal výborný priebeh. Na konci niekto zhasol svetlo a povedal "Ženy, vyzlečte sa". Keď zapli svetlo, ženy boli vyzlečené. Potom zasa niekto zhasol svetlo a povedal "Muži, vyzlečte sa". Keď zase zapli svetlo, tak niekto povedal "A teraz do práce!". Tak sme tu.', 431, 3.48, 36),
	(8203, 'Viete prečo sa policajti šúchajú o stenu?\r\nLebo chcú byť drsní chlapi.', 77, 3.45, 36),
	(8204, 'Idú dvaja policajti po moste. Zrazu ich dobehne chlapec, jednému niečo pošepne do ucha a ten mu vypáli facku. Druhý sa ohradzuje, že čo ho bije.\r\n- Vieš čo mi povedal? Že má pod mostom sučku, aby som mu ju išiel pretiahnuť, vraj chce mať policajného psa. \r\n- A ty ho za to biješ? Veď aj ja by som jedného zobral.', 332, 3.45, 36),
	(8205, 'Policajti spisujú zápisnicu na mieste činu:\r\n- Obeť bola zasiahnutá štyrmi strelnými poraneniami, no našťastie len dve z toho boli smrteľné.', 151, 2.67, 36),
	(8206, 'Policajt priviedol na oddelenie chlapa. Nadriadený sa ho pýta:\r\n- Prečo ste ho predviedli?\r\n- Mal u seba  zbraň.\r\n- Akú zbraň? \r\n- Nôž, prosím.\r\n- Kde?\r\n- V chrbte.', 173, 3.19, 36),
	(8207, 'Prečo nosia policajti vždy pri sebe nožík?\r\nAby mohli zlodejom odrezať cestu.', 82, 3.34, 36),
	(8208, 'Dvaja policajti sa hádajú, kto má sprostejšieho syna. Prvý ukazuje: \r\n- Janko, choď dolu na zastávku električky a pozri sa, či tam nie som.\r\nJanko zbehne dolu pozrie sa, otca neuvidí, vybehne hore a povie otcovi:\r\n- Nie oco, nebol si tam.\r\nDruhý, prizerajúci sa policajt povie:\r\n- Naozaj je sprostý, veď sa mohol pozrieť z okna !', 344, 3.11, 36),
	(8209, 'Na kraji cesty stoja dvaja policajti a robia obhliadku nájdenej kostry. Prvý vraví:\r\n- To je kostra ženy, nie?\r\n- Hmm, nie, to bude kostra muža!\r\nOkolo ide taký pripitý chlapík, počuje ich ako sa hádajú a vraví:\r\n- Nehádajte sa, však to je kostra z bicykla.', 271, 3.03, 36),
	(8210, 'Dvaja policajti stoja pri trati, po ktorej práve prechádza vlak. Ten jeden hovorí:\r\n- Tá lokomotíva, tá si to ale serie, že?\r\nA druhý pritakáva:\r\n- No hej, ale ani tie vagóny nejdu zle...', 197, 3.05, 36),
	(8211, 'Chváli sa policajt občanovi:\r\n- Mne sa stačí na človeka len pozrieť a hneď viem, čo si myslí.\r\nA občan na to:\r\n- A to vám nie je teraz hlúpo tak pri mne stáť? ', 173, 3.13, 36),
	(8212, 'Hovorí policajt kolegovi:\r\n- Včera som kúpil záchodovú kefu.\r\n- No a, aká je?\r\n- Toaletný papier bol lepší.', 116, 3.77, 36),
	(8213, 'Pět policajtů stojí přede dveřmi, na nichž je nápis TLAČTE!\r\nKolik se jich posere?\r\nJenom tolik, kolik umí číst.', 123, 3.34, 36),
	(8214, 'Robia sa skúšky na Policajnej akadémii. Prvého sa pýtajú.\r\n- Nosí sa to na nohách. Má to podrážky. Čo je to?\r\n- Neviem.\r\n- Topánky.\r\nVychádza von a tam sa ho pýta ďalší chlap. \r\n- Aká bola odpoveď?\r\n- Topánky.\r\nChlap vojde dnu a pýtajú sa ho.\r\n- Visí to na stene a robí to tik-tak. Čo je to?\r\nRozmýšľa.\r\n- Má to šnúrky?\r\n- Nie.\r\n- Sandále.', 372, 3.6, 36),
	(8215, 'Príde policajt do papiernictva a pýta si hviezdičkový papier. Predavačka hovorí, že majú kockovaný, linajkový ale hviezdičkový nemajú. Druhý deň príde a pýta si atrament na veľké písmená. Predavačka mu ponúka zelený, modrý, červený, ale na veľké písmena nemá. Na tretí deň príde náčelník do papiernictva. Predavačka sa mu ponosuje akého má podriadeného. On prisvedčí, že je trochu hlúpy a hovorí. \r\n- Ale keď už som tu, nemáte náhodou glóbus Európy?', 501, 3.31, 36),
	(8216, 'Otázka: Ako sa volá najrýchlejšie zviera na svete?\r\nOdpoveď: Motorizovaný policajt.', 89, 3.09, 36),
	(8217, 'Policajt napomína svojho syna:\r\n- Nefajči Jožko, si na to primladý!\r\n- Ale oco, aj ty si bol piatak, keď si začal fajčiť!\r\n- To áno synak, ale vtedy som mal už šesťnásť!', 183, 3.42, 36),
	(8218, '- Strážmajster, prečo je ten chlap nahý?\r\n- Viete, to je odhalený páchateľ.', 82, 2.91, 36),
	(8219, 'Policajti nájdu tri granáty. Jeden z nich si ich začne hádzať v ruke. Jeho kolega mu hovorí, aby prestal lebo mu jeden z nich buchne. On na to:\r\n- Nevadí, povieme, že sme našli len dva.', 194, 3.23, 36),
	(8220, 'Havária lietadla. Pošlú tam dvoch policajtov, aby to vyšetrili. Prídu na miesto a obzerajú si trosky. Prvý sa ozve :\r\n- No páni, myslím, že mu odpadla vrtula.\r\n- Ale netrep, však to je prúdové lietadlo.\r\n- Potom je to jasné, vypli prúd!', 251, 3.24, 36),
	(8221, 'Cestná kontrola. Policajt stojí so šoférom pred autom a hovorí:\r\n- Pán vodič, nesvieti vám heligón!\r\n- Mysleli ste halogén, nie?\r\n- Nie ste vy nejaký suvenír?', 170, 3.15, 36),
	(8222, 'V Prahe chodí po križovatke policajt s rebríkom na chrbte. Príde k semaforu, otvorí ho, nazrie dnu a zatvorí ho. Prejde cez cestu k druhému semaforu, otvorí ho, nazrie dnu a znovu ho zatvorí. Po chvíli príde k nemu pani a pýta sa:\r\n- Prosím vás, co to tady deláte?\r\nA policajt jej hovorí:\r\n- No, to víte, já jsem dostal dva lístky do Semaforu a teď nevím do kterého.', 388, 3.1, 36),
	(8223, 'Mestský policajt kontroluje občana, pričom sa trocha chváli:\r\n- Mne stačí na človeka iba pozrieť a hneď viem, čo si myslí.\r\n- A nie je to pre vás nepríjemné?', 171, 3.03, 36),
	(8224, 'Viete, ako policajti otvárajú konzervy?\r\nOtvorte, tu polícia!', 64, 3.16, 36),
	(8225, 'Policajt spovedá totálne opitého vodiča:\r\n- Ako ste mohli v takomto stave vôbec sadnúť za volant?\r\nA vodič na to:\r\n- Tiež sa čudujem, ale našťastie mi pomohli kamaráti.', 181, 3.33, 36),
	(8226, 'Na tanečnej zábave bijú policajta. Ten vysielačkou privoláva pomoc:\r\n"Tu orol, tu orol, bijú ma !"\r\n"A kde ?"\r\n"Všade, po hlave, po chrbte."', 147, 3.33, 36),
	(8227, 'Na pôrodnickom oddelení sa narodí geniálne dieťa.Len čo ho vybrali a umyli potľapkali ho po zadočku a ono začalo rozprávať samé zložité matematické vzorce. Lekári sa rozhodli,že mu odoberú radšej polovicu mozgu, kým je malinké. Operácia sa podarila, dieťatko sa preberá a začne hovoriť samé fyzikálne vzorce. Operáciu teda zopakovali a zo zvyšného mozgu odobrali znova polovicu. Dieťatko sa prebralo a začalo s chemickými vzorcami. Lekári si nevedeli rady, tak sa dohodli že zoberú aj zvišnú časť mozgu. Operácia sa podarila. Dieťatko sa preberá a lekári napäto očakávajú čo povie.A dieťa:\r\n"Občianske preukazy vy svine!"', 673, 3.3, 36),
	(8228, 'Hádali sa deti policajtov,kto z nich má najsprostejšieho otca:\r\n"Môj otec raz prešiel na červenú,potom zastavil a naparil si pokutu."\r\n"Môj otec si raz sadol do auta,a keď zistil že je opitý,odviezol sa na záchytku."\r\n"Môj otec raz išiel do TUZEXU,preskočil pult a požiadal o azyl."', 298, 3.19, 36),
	(8229, 'Do vlakového kupé vbehne chlapík a zadychčaný hovorí: \r\n- Ľudia, práve som počul bohovský vtip o policajtoch.\r\nJeden chlapík sa na neho pozrie a hovorí: \r\n- Ale ja som policajt.\r\n- Nevadí, vám to poviem pomaly a dvakrát.', 235, 3.1, 36),
	(8230, 'Fero zažaloval nejakého cudzinca za ublíženie na zdraví pri autonehode. Na pojednávaní sa cudzincov obhajca pýta:\r\n- Je to pravda, že na mieste nehody ste policajtovi na otázku "Ako sa cítite?", odpovedali "Ešte v živote som sa necítil lepšie!"?\r\n- Áno, to je pravda. - súhlasí Fero.\r\n- Tak prečo potom obviňujete môjho klienta, že vám spôsobil vážnu ujmu na zdraví?\r\n- Keď k nehode prišiel onen policajt, tak podišiel k môjmu koňovi Pejovi, ktorý mal zlomenú nohu a zastrelil ho. Potom podišiel k môjmu psovi Azorovi, ktorý bol tiež celý dochrámaný a zastrelil ho. Potom podišiel ku mne a spýtal sa ma "Ako sa cítite?". Čo som mu mal odpovedať? \n\n', 694, 3.38, 36),
	(8231, 'Dva polcajti si to vykračují ulicí.\r\n"Hele," ukazuje jeden z nich k obloze, "helikoptér."\r\n"To není helikoptér," opravuje ho premiant zvláštní policejní školy, "ale helikoptéra."\r\n"Kamaráde," žasne praporčík, "jak ty máš dobré oči."', 252, 3.17, 36),
	(8233, 'Náčelník policie přijde na strážnici a vidí strážmistra jak píše na stroji a má na ruce dvě černé pásky.Zeptá se co se vám stalo strážmistře?\r\n"Ale zemřela mi matka."\r\n"Tak upřímnou soustrast a vemte dneska volno ale proč máte ty pásky dvě?"\r\n"Tomě volal brácha že mu taky zemřela matka. "', 321, 3.05, 36),
	(8234, 'Idú dvaja policajti po ulici a jeden sa sťažuje druhému.\r\n- Predstav si, bol som u lekára a doktor mi povedal, že pravdepodobne mám tífus. Čo mysliš je to nebezpečné? \r\n- Tak to je velmi nebezpečná choroba - odpovedá druhý. Pri takej chorobe bud prídeš o rozum alebo zomrieš. \r\n- A odkiaľ to vieš - pýta sa prvý.\r\n- No, ja som to už mal. ', 362, 2.95, 36),
	(8235, '- Čo sa stalo počas vašej nočnej služby, strážmajster?\r\n- No, idem si večer po parku a jedna ženská na mňa, že: "Pretiahni ma, pretiahni ma..."\r\n- A pretiahli ste ju?\r\n- Nebolo cez čo, ani plot tam nebol, ani žiadne lano.', 235, 3.08, 36),
	(8236, 'Prešovská policajná hliadka nájde obesenca. Idú spísať zápisnicu:\r\nV piatok 19.11.1999 o 23:15 sa našiel mladý obesen.,no nevedia nijako príst na to, aké i sa píse v slove obeseny. Dostanú geniálny nápad, odviezť obesenca do Košíc. Zavesia ho na prvú vŕbu a spokojne odchádzajú.O hodinu prechádza okolo vŕby košická hliadka, zrazu Ďuro zbadá obesenca a vraví Ferovi:\r\n"Feri, kukaj ten obesenec je tu zas !"', 436, 3.37, 36),
	(8237, 'Prečo chodia policajti na vyšetrovačky so psami?\r\nAby tam mal aspoň niekto rozum.', 85, 3, 36),
	(8238, 'Dvaja policajti sú na poľovačke v pralese. Zrazu vidia, že sa k nim blíži lev. Preľaknú sa, jeden vylezie na strom, druhý začne behať okolo stromu. Policajt na strome kričí na bežiaceho kolegu:\r\n"Rýchlo vylez na strom, lebo ťa chytí!"\r\nKolega mu sebaisto zakričí:\r\n"Pochybujem, že me chytí, veď mám už štyri kolá náskok!"', 348, 3.05, 36),
	(8239, 'Prečo sa pod policajtom ohýba doska?\r\nLebo múdrejší ustúpi.', 65, 3.29, 36),
	(8240, 'Zastaví dva policisté pana Nováka. \r\n- Pane Novák, slyšeli jsme, že o nás vyprávíte vtipy, který se nezakládají na pravdě, dělají z nás debily a negramoty. Vy nevíte, že polovina policistů jsou středoškoláci a ta druhá půlka vysokoškoláci?\r\n- Jó pánové, tak tenhle fór není ode mne.', 313, 3.13, 36),
	(8241, 'Príde chlap na policajnú stanicu a opýta sa vrátnika kde je bonzáreň. Vrátnik ho pošle na prvé poschodie. Chlapík zaklope, vojde a službukonajúci policajt sa ho pýta čo si praje. Chlap mu odpovie:\r\n"Môj sused má na dvore kopu dreva!"\r\n"No a čo, to nie je žiadny trestný čin."\r\n"Ale on s tým chodí za hranice!"\r\n"To tiež nie je trestný čin."\r\n"Ale on v tom vozí zlato!"\r\nPolicajt sa poteší a pošle chlapa domov. Ked príde chlap domov zdvihne telefon a volá susedovi: \r\n"Sused,  zohnal som ti ľudí na rúbanie toho dreva. Budú ti to robiť tí istí, čo ti na jar\r\nkopali záhradu."', 615, 3.37, 36),
	(8242, 'Prečo chodí policajt do garáže s obuškom?\r\nLebo chce dobiť baterky.', 73, 2.92, 36),
	(8243, 'Rozčúlený policajt vtrhne do Mototechny, nahnevane hodí na pult akýsi balíček a zreve na predavačku:\r\n- Viete čo? Minulý týždeň som si u vás kúpil odrazové sklíčka a ako som zistil, predali ste mi akési nepodarky!\r\n- Naozaj? - čuduje sa predavačka.\r\n- Veru! Len raz som sa s nimi odrazil od steny garáže a už je po nich.', 344, 2.92, 36),
	(8244, 'Proč policajti jezdí na kole v holinkách ?\r\nAby od šlapek nedostali AIDS !', 78, 3.13, 36),
	(8245, 'Manželský pár se byl potápet v zátoce San Franciska a žena se pritom ztratila.Zoufalý manžel se vrátil domú a oznámil celou vec policii. Druhý den ráno zazvoní zvonek a za dvermi stojí dva polište s vážnym výrazem ve tvári.\r\n"Pán Walker? Máme informace o vaší paní."   \r\n"Co se ji stalo"?\r\n"Máme pro vás tri zprávy. Jednu špatnou,jednu dobrou a jednou skvelou.Kterou chcete slyšet nejdřiv?"\r\n"Tu špatnou."\r\n"Našli jsme vaší paní utopenou v zátoce."\r\n"Jaká je tá dobrá zpráva?"  \r\n"Když jsme ji vytáhli, měla na sobě dobre dva tucty krabu a dva kilové humry."\r\n"No a jaká múže byt tá skvělá zpráva?"\r\nPolicista se usmál, mlsne se olizl a povída:  \r\n"Zítra ráno ji zase vytáhneme."', 737, 3.29, 36),
	(8246, 'Stretnú sa dvaja policajti a jeden hovorí druhému:\r\n- Vieš o tom, že včera nám robili IQ testy?\r\n- No a ako ti dopadli?\r\n- Naštastie negatív!', 150, 3.13, 36),
	(8247, '"Pane, išli ste rýchlosťou 120 Km/hod."\r\n"Ale, pán policajt, to je hlúposť, veď bývam len 5 Km odtiaľto!"', 114, 3.22, 36),
	(8248, 'Ako policajt zistí, že v rybníku nie je voda?\r\nPráši sa mu spod vesiel.', 76, 3, 36),
	(8249, 'Ide policajt po moste a vraví si:\r\n"Ja sa poserem, ja sa poserem, no nevravím?"', 81, 3.18, 36),
	(8250, 'Prečo majú policajti rozopnutý razporok?\r\nKeby náhodou museli napočítať do jedenásť.', 93, 2.98, 36),
	(8251, 'Dvaja policajti našli na chodníku zrkadielko.\r\n"Aha, moja fotka!",zvolá prvý, keď sa doň pozrie.\r\n"Figu, moja fotka!",nedá sa druhý, tiež keď doňho pozrie.\r\nIde okolo ich náčelník.\r\n"Čo sa tu vadíte a navyše v službe!",zvolá na nich.\r\n"Prosím, my sme našli na chodníku moju fotku.",vraví prvý.\r\n"Nie, to je moja fotka!",vraví druhý.\r\n"Ukážte to sem."\r\nNáčelník im zoberie zrkadielko a pozrie sa doň.\r\n"Idioti, veď to je moja fotka," a zoberie im ho.\r\nPríde domov a od prahu sa chváli žene:\r\n" Predstav si, aký som populárny. Vonku po meste sú moje fotky, jednu našla aj naša hliadka."\r\n"Oci, ukáž mi ju," zvolá dcéra.\r\n"Vyber si ju z tašky." \r\nDcéra vybrala zrkadielko, pozrela sa doň a zvolala:\r\n"Mama, oco má frajerku!"\r\n"Ukáž to sem,"vezme jej matka zrkadlo z ruku a pozrie sa doň.\r\n"Naozaj a akú škaredú!"', 864, 3.15, 36),
	(8252, 'Prečo nosia policajti čiapku?\r\nAby im vietor nevyfúkol piliny z hlavy.', 73, 3.1, 36),
	(8253, 'Rozprávajú sa traja policajti o tom, aké majú hlúpe ženy.\r\nPrvý hovorí: \r\n- Predstavte si, ja mám takú hlúpu ženu, kúpila si rádio a pritom je hluchá.\r\nDruhý hovorí: \r\n- To je nič, ja mám takú hlúpu ženu, kúpila si televízor a pritom je slepá.\r\nTretí hovorí: \r\n- Chlapci to je nič. Moja žena ide na mesiac na liečenie a kúpila si 30 kondómov. No vari si nemyslí, že za ňou budem každý deň chodiť!', 435, 3.35, 36),
	(8254, 'Stretnú sa dvaja policajti a jeden vraví druhému:\r\n"Bol som včera u doktora na zistenie otcovstva. Predstav si, bral mi krv, ale neviem prečo z prsta..."', 158, 3.02, 36),
	(8255, 'Potkaj se dva policajtí a jeden z nich má zmrzlinu.\r\n"Člověče kdes jí sehnal?"\r\nPtá se druhej.\r\n"Za rohem je cukrárna a tam jí maj."\r\n"A je tam velká fronta?"\r\n"Ani ne. Tak na půl zásobníku."', 204, 2.89, 36),
	(8256, 'Policajt zastaví nákladní vůz a praví:\r\n"Už potřetí Vám říkám, že Vám z auta stříká voda !"\r\nŘidič na to:\r\n"A já Vám po třetí říkám, že to je kropící vůz!"', 185, 3.23, 36),
	(8257, 'Vieš, akú farbu má rubikova kocka policajtov?\r\nZelenú.', 58, 2.9, 36),
	(8258, 'Idú dvaja policajti po ulici a zrazu zbadajú na zemi päťkorunáčku. Ten prvý vraví tomu druhému:\r\n"Zodvihni tých päť korún."\r\n"Hádam sa nebudem ohýbať pre päť korún".\r\n"Ty somár ale s tým sa dá telefonovať".\r\nTen druhý ju zodvihne, priloží si ju k uchu a kričí:\r\n"Haló, haló..."', 307, 3.07, 36),
	(8259, 'Policajt zastaví podnapitého vodiča auta a hovorí mu:\r\n- Ste ochotný podrobiť sa skúške alkoholu?\r\nVodič celý natešený:\r\n- Jasné. V ktorej krčme?', 159, 2.86, 36),
	(8260, 'Príde policajt do Obuvi:\r\n"Prosím Vás, máte hnedé kožené poltopánky?"\r\n"Máme. Aké máte číslo?"\r\n"158."', 115, 3.16, 36),
	(8261, 'Viete ako zvyknú policajti volať svoje obušky?\r\nVUML - Vulkanizovaný Učiteľ Marxizmu Leninizmu.', 101, 2.94, 36),
	(8262, 'Seržant sa vráti s dovolenky a náčelník sa ho pýta:\r\n- Tak, seržant, ako sa mi máte?\r\n- Ále, náčelník, zomrela mi matka.\r\n- Seržant! Ja som sa pýtal, ako sa máte vy a nie ako sa má vaša matka.', 209, 2.91, 36),
	(8263, 'Na policajnej akadémii prijímajú nových uchádzačov. Pýtajú sa jedného, koľko je 4 plus 4.\r\n- 12.\r\n- Výborne, ste prijatý. Povedali ste nám viac, ako sme od vás očakávali.', 186, 3.43, 36),
	(8264, 'Na policajnej akadémii sa robia ústne skúšky. Prvý nádejný policajt ide dnu a o hodidu vyjde von celkom zničený. Všetci sa okolo neho nahrnú a už sa ho pýtajú:\r\n- Tak čo, bolo to ťažké?\r\n- Veľmi. Také otázky sa ma pýtali, o ktorých som nikdy nepočul.\r\n- Povedz aspoň jednu!\r\n- Nuž, pýtali sa na hlavné mesto Ruska.\r\n- A čo, vedel si?\r\n- Áno, Moskva!\r\nTen, čo ide hneď po ňom si túto odpoveď napíše na kúsok papiera, a papierik vloží nenápadne do topánok. Vojde dnu a už ho aj zahrňujú otázkami. Asi po pol hodine sa ho opýtajú, ako sa volá hlavné mesto Ruska. Nenápadne si vloží ruku do topánok, pozrie sa a zo sebaistým úsmevom povie:\r\n- Partizánske!', 708, 3.09, 36),
	(8265, 'Ide mestský policajt po chodníku a premýšľa...', 51, 3.15, 36),
	(8266, 'Idú dvaja policajti po lese vidia ruku. Jeden hovorí:\r\n"Aha, Jožova ruka."\r\nIdú ďalej a jeden hovorí:\r\n"Aha, Jožova noha."\r\nIdú ďalej a vidia hlavu a ten druhý hovorí:\r\n"Aha, Jožova hlava."\r\nTomu prvému to nedá a hovorí:\r\n"Dúfam, že sa mu nič nestalo."', 270, 3.11, 36),
	(8267, 'Policajti prídu na výsluch k podozrivému. Zaklopú na dvere. On sa spýta:\r\n- Kto je tam?\r\n- Tu polícia, otvorte!\r\n- A čo chcete?\r\n- Chceme sa porozprávať!\r\n- A koľko vás je?\r\n- Dvaja.\r\n- Tak sa porozprávajte.', 219, 3.04, 36),
	(8268, 'Všetci policajti dostali nové digitálne hodinky. A chodec sa pýta policajta:\r\n"Pán policajt, koľko je hodín?"\r\n"Jedenásť deleno dvatsať tri, ale nemám čas tak si to vypočítaj sám."', 195, 2.82, 36),
	(8269, 'Prečo je pred osobitnou školou veľa policajných áut?\r\nLebo je rodičovské združenie.', 91, 2.85, 36),
	(8270, 'Na políciu prijímajú nováčikov. Príde prvý za riaditeľom a riaditeľ sa pýta:\r\n"Vieš čítať?"\r\n"Áno.A písať?"\r\n"Nie."\r\nRiaditeľ ho vyhodí. Príde druhý. Riaditeľ sa pýta:\r\n"Vieš písať?\r\n"Áno."\r\n"A písať?"\r\n"Nie."\r\nRiaditeľ ho vyhodí. Príde tretí. Riaditeľ sa spytuje:\r\n"Vieš písať?"\r\n"Áno."\r\n"A čítať?"\r\n"Áno."\r\n"A naučíš ma to?"', 371, 2.92, 36),
	(8271, 'Ide podnapitý detvanec autom a zastaví ho policajná hliadka. Prídu k nemu a jeden z policajtov sa ho pýta: \r\n- Pán vodič, mohli by ste nám fúknuť?\r\nDetvanec sa na nich pozrie a hovorí:\r\n- Samozrejme, a ktorému prvému?', 230, 2.93, 36),
	(8272, 'Policajt nastúpi do električky a štikne si dva lístky. Vedľastojací pán si to všimne a pýta sa:\r\n- Prosím vás, prečo ste si štikol dva lístky?\r\n- No predsa keď jeden stratím, tak mám druhý.\r\n- A keď sratíte aj druhý? \r\n- No tak mám mesačník.', 265, 3, 36),
	(8273, 'Prejde červená Corsa na červenú. Za semaforom ju zastaví policajt. Vystúpi mladá kočka. Policajt:\r\n"Viete akého priestupku ste sa dopustili?"\r\n"Áno, viem. Nemohli by ste tentokrát prižmúriť oči? Viete, ja som vysokoškoláčka, tento rok končím. Nemám peniaze nazvyš."\r\n"No dobre, že ste vysokoškoláčka, choďte."\r\nO rok ten istý policajt, tá istá križovatka, ten istý priestupok, ale v podaní zelenej Corsy. Opäť mladá vodička: \r\n"Pán policajt, nemôžete prižmúriť oči, viete, ja som vysokoškoláčka, tento rok končím."\r\n"Mňa neodžubete, vysokoškoláci končili minulý rok."', 622, 3.16, 36),
	(8274, 'Prídu dvaja policajti na zastávku MHD:\r\n"Pán kolega ideme autobusom alebo pešo?"\r\n"No uvidíme čo príde skôr."', 117, 2.97, 36),
	(8275, 'Prečo plače policajtovo dieťa na poli?\r\nVykopalo si jamu a nemôže si ju zobrať domov.', 91, 3.29, 36),
	(8276, 'Policajt chce ísť do kina. Rozčúlený sa vrhne k pokladni:\r\n"Dajte mi knihu sťažností a ešte jeden lístok."\r\nPrekvapená pokladníčka hovorí policajtovi:\r\n"Prosím Vás, veď vy kupujete už siedmy lístok!"\r\n"Áno, ale čo mám robiť, keď tá žena pri dverách mi ho vždy roztrhne?!"', 299, 3, 36),
	(8277, 'Prijímacie skúšky do policajného komanda. Kto uspeje, stane sa členom elitnej jednotky. Veliteľ vydá rozkaz kandidátovi:\r\n"Vidíte tú železničnú stanicu?"\r\n"Vidím."\r\n"Zneškodnite ju! "\r\nO hodinu neskôr kandidát hlási:\r\n"Splnil som rozkaz!"\r\n"Výborne! A ako ste to urobili?"\r\n"Vidíte túto igelitovú tašku, pán veliteľ? Mám v nej všetky cestovné lístky!"', 380, 2.93, 36),
	(8278, 'Vráti sa policajt večer domov z roboty a celý ustarostený vyjde na balkón, pozerá na nebo a vzdychá: \r\n- Tak ďaleko! Tak vysoko!\r\nJeho manželke to nedá a pýta sa ho:\r\n- Čo ťa trápi? Čo toľko vzdycháš?\r\n- Ale, šéf ma posiela na mesiac na služobnú cestu.', 274, 3.02, 36),
	(8279, 'Stretnú na ulici dvaja službukonajúpci policajti krívajúceho farára a pýtajú sa ho čo sa mu stalo a farár im hovorí že mu spadol na nohu bojler. Ked farár odišiel jeden policajt sa pýta toho druhého či nevie čo je to bojler a ten druhý mu odpovedá:\r\n"Neviem, lebo ja do kostola nechodím."', 309, 3.01, 36),
	(8280, 'Idú dvaja policajti na obhliadku a jednému padne do očí automat na kávu,príde k nemu a uvidí:vhodiť 7 SK.Vhodí a vypadne káva.Celý naradovaný vhodí ešte raz a vypadne daľšia.A tak stále dokola kým nepríde daľší a hovorí:\r\n"Kámo, už sa musíme vrátiť"\r\n"Šibe ti? Teraz keď vyhrávam?"', 312, 3.1, 36),
	(8281, 'Viete prečo chodia policajti vždy vo dvojici?\r\nLebo jeden nikdy nevie.', 72, 3.02, 36),
	(8282, 'Prečo, keď policajti idú na aute dolu kopcom otvárajú okno?\r\nLebo vyhadzujú rýchlosť.', 93, 3.05, 36),
	(8283, 'Policajtka Máňa riadila dopravu na križovatke, keď práve vtedy dostala \'ženské problémy\'. Keď išli okolo v aute policajti, zastavila ich a hovorí:\r\n- Chlapci, choďte k nám na štvorku a povedzte im, že som to dostala, že tu nemôžem takto stáť, že musím ísť domov, nech ma príde niekto vystriedať.\r\n- Spoľahni sa, Máňa, už tam ideme. - odpovedali policajti a odišli. \r\nAsi po hodine už je Máňa celá nesvoja a zastaví s rovnakým prianím ďalšie policajné auto. A za ďalšiu hodinu ďalšie a tak to šlo dluho, až stratila nervy, opustila križovatku a išla na svoj štvrtý okrsok polície povedať im to sama. Otvorila dvere a čo vidí: asi štyridsať ožratých policajtov si neustále nalieva poháriky a každý radostne kričí: \r\n- Máňa to dostala, Máňa to dostala!', 818, 3.16, 36),
	(8284, 'Policajt pred kabínkou verejného WC:\r\n"Počúram sa... počúram sa... počúram sa... No nevravel som?"', 106, 2.95, 36),
	(8285, 'Dvaja policajti riadia dopravu na križovatke vyše šesť hodín. Jeden hovorí druhému :\r\n" Už si necítim nohy!"\r\n" Tak si pričuchni k mojim."', 148, 3, 36),
	(8286, 'Skouška u policajtú:\r\n"Do you speak english ?"\r\n"Ehm,Ehm,Hm"\r\n"Ven,další."\r\n"Do you speak english ?"\r\n"Ehm,Ehm,Hm"\r\n"Další."\r\n"Do you speak english ?"\r\n"Yes, I do."\r\n"Ehm,Ehm,Hm."', 185, 3.16, 36),
	(8287, 'Príde policajt do práce a hovorí: \r\n- Chlapi, ja som geniálny! \r\n- Prosím ťa, a ako si na to prišiel? \r\n- No predstavte si kúpil som si puzzle a tam bolo napísané 3-5 rokov. A ja som to zložil už za rok.', 215, 3.24, 36),
	(8288, 'Prečo sa policajti šúchajú o stenu?\r\nAby boli drsní chlapi.', 64, 3.34, 36),
	(8289, 'Policajt zastaví auto a vodičovi hovorí: \r\n"Pán vodič, vyhrali ste 5000 $. Čo spravíte s peniazmi?" \r\n"Neviem, asi sa prihlásim na autoškolu." \r\n"Aaale, nepočúvajte ho, keď má vypité, tára blbosti!" odvrkne spolujazdec. \r\nV tom sa zobudí muž na zadnom sedadle, zbadá policajta a hovorí: \r\n"Do kelu, vedel som, že v kradnutom aute ďaleko nezájdeme." \r\nPo chvíľke sa ozve zaklopanie z kufra a niekto sa po španielsky pýta: \r\n"Už sme za hranicami?"', 472, 3.03, 36),
	(8290, 'Policajný šéf kúpil trezor. Dal si zavolať svojich podriadených a hovorí:\r\n"Toto je najbezpečnejší trezor v celom meste. Má 8-miestny kód. Sú to síce samé 4-ky, ale nepoviem Vám v akom poradí."', 210, 2.84, 36),
	(8291, 'Viete prečo policajti nosia so sebou v aute motorovú pílu?\r\nAby mohli rezať zákruty.', 89, 2.77, 36),
	(8292, 'Na mieste havárie lietadla sú dvaja policajti a rozmýšľajú, čo napíšu do kolonky "Príčina nehody". Zrazu sa jeden opýta druhého:\r\n- Počúvaj ma, to bolo prúdové lietadlo, že?\r\n- Jasné, že bolo. Také niečo nepoznáš, alebo čo?\r\n- No dobre, dobre... tak tam napíšeme, že vypli prúd.', 307, 2.78, 36),
	(8293, 'Príde mladík na policajnú akadémiu a hovorí:\r\n- Som absolvent osem ročného gymnázia a chcel by som sa k vám prihlásiť.\r\n- A máte aspoň základné vzdelanie?', 169, 3, 36),
	(8294, 'Vieš prečo majú policajti bielu čiapku a slepci bielu palicu?\r\nAby boh vedel komu zobral rozum a komu zrak.', 111, 2.85, 36),
	(8295, 'Dvaja policajti prídu ráno do práce nahí. Šéf sa ich hneď na rannej porade pýta:\r\n"Čo to má znamenať?"\r\nOni odpovedajú:\r\n"No, boli sme tak, ako ste nám kázali, skontrolovať ten nový nočný diskotékový klub."\r\nŠéf na to:\r\n"V poriadku. Ale prečo ste prišli nahí?"\r\nJeden vysvetľuje:\r\n"No hrala tam hudba a svietili svetlá. Po chvíli svetlá zhasli, hudba stíchla a D.J. vraví "Ženy do naha!". Ženy sa vyzliekli a tancovalo sa ďalej. Opäť sa po chvíli ozvalo "Muži do naha!". Tak sme sa vyzliekli aj my, aby sme naboli nápadní. Potom sa opäť tancovalo, keď sa tu z ničoho-nič ozvalo "A teraz do práce!".\r\nTak sme tu.....šéfe...!"', 672, 3.14, 36),
	(8296, 'Čo urobí policajt keď dostane chuť na lekvár ?\r\nOlúpe si buchtu.', 70, 3.04, 36),
	(8297, 'Ide policajt okolo mrakodrapu a zbadá dvoch mužov, ktorí skáču dolu. Dopadne prvý opráši sa a ide ďalej, skočí druhý a udeje sa presne to isté. Príde k nim policajt a pýta sa:\r\n"Chlapci ako je to možné, že skočíte a nič sa Vám nestane?"\r\n"Ale to nič nie je, skús to s nami."\r\nVylezú hore prvý skočí a zasa nič, opráší sa a ide ďalej skočí druhý a to isté. Policajt si povie, však keď sa im nič nestalo ani druhý raz, skočím si. Skočí a rozpľasne sa.\r\nTí dvaja sa chytia za ramená a hovoria.\r\n"Nato, že sme anjeli sme teda dobrí hajzli."', 586, 3.16, 36),
	(8298, 'Blondínku na aute zastaví policajt a chce vidieť vodičský preukaz.\r\nBlondínka hovorí:\r\n"Čo to je?"\r\n"To je taký tvrdý hranatý štvorček."\r\nBlondínka vyitiahne zrkadielko a podá ho policajtovi. Ten pozerá na blondínku potom do zrkadla zase na blondínku zase do zrkadla a nakoniec hovorí.\r\n"Prepáčte, nevedel som že ste tiež príslušník."', 360, 3.2, 36),
	(8299, 'Za starých čias naháňa príslušník VB zlodeja. Ten sa schová na verejných WC. Príslušník podíde k záchodu a zabúcha:\r\n- Otvorte, tu véé béé!\r\n- Neotvorím, tu véé céé!', 189, 3.64, 36),
	(8300, 'Policajti dostali za úlohu zmerať výšku stĺpa. Chodia okolo stĺpa, špekulujú a nemôžu na to prísť. Príde k nim kolega a hovorí: \r\n"Mám nápad, zvaľme stĺp a potom ho odmeriame." \r\n"Ty blbec, my potrebujeme jeho výšku a nie dĺžku."', 251, 3.23, 36),
	(8301, 'Viete koľko trvá policajtovi napísať na tortu:\r\n"Všetko najlepšie?"\r\nŠesť hodín. Jednu hodinu to klepe na stroji a potom zvyšných päť tu tortu z toho stroja vyberá.', 178, 3.3, 36),
	(8302, 'Idú dvaja policajti a nájdu malé zrkadlo. Zodvihnú ho a jeden hovorí: \r\n"Aha môj služobný preukaz."\r\n"Nie to je môj služobný preukaz."\r\nIdú teda za náčelníkom aby ich rozriešil. Náčelník pozrie a povie:\r\n"To je môj služobný preukaz.", \r\na strčí si ho do vrecka. Doma si jeho dcéra pýta peniaze. Otec jej povie nech si ich vezme z vrecka. Dcéra vytiahne zrkadlo a kríčí na mamu:\r\n"Mamí, oco má frajerku."\r\n"Ukáž, fúj a akú škaredú."', 469, 3.62, 36),
	(8303, 'Hlási podnikateľ policajtovi:\r\n- Uniesli mi dcéru.\r\nPolicajt:\r\n- A pýtali už výkupné?\r\n- Áno.\r\n- A koľko?\r\n- Milión korún v 1000, 500, 200 a 100 korunových bankovkách.\r\nPolicajt:\r\n- Aj s DPH?', 204, 2.76, 36),
	(8304, 'Prečo  kýve policajt s mobilom v ruke rýchlo zo strany na stranu?\r\nAby ho nechytil signál, keď mu bude volať svokra...', 124, 2.82, 36),
	(8305, 'Rozhovor dvoch policajtov:\r\n- Aha pán plukovník, tamto letí lietadlo. To je vládne alebo civilné?\r\nPlukovník:\r\n- No to je civilné! Keby bolo vládne, tak logicky pred ním idú motorky.', 192, 3.02, 36),
	(8306, 'Polícia vypisuje konkurz na miesto detektíva, podmienky: výška najmenej 180 cm, dobrá fyzická kondícia, ovládanie AJ a práce s PC. Na druhý deň príde na stanicu asi 80-ročný dedko s francúzskou palicou, strojčekom na sluch a s okuliarmi, ktoré majú aspoň 10 dioptrií a hovorí: \r\n- Dobrý deň, ja som prišiel na ten konkurz.\r\nJeden z policajtov mu odpovedá: \r\n- Ale veď nespĺňate ani jednu požiadavku.\r\nA dedko na to:\r\n- Však ja som vám len prišiel povedať, aby ste so mnou nerátali.', 515, 3.18, 36),
	(8307, 'Slimák jazdí v mercedesi a má stiahnuté okno, zastaví ho policajt:\r\n"Slimák, prečo máš stiahnuté okno."\r\n"Lebo mám dlhé oči!"', 138, 2.62, 36),
	(8308, 'Policajt dvihne telefón.\r\n"Kto volá?"\r\n"Prosím Vás, prosím vás pomôžte mi, do bytu mi vošla mačka!"\r\n"A to nám kvôli takej blbosti voláte. A kto volá?"\r\n"Papagáj!"', 178, 2.99, 36),
	(8309, 'Policajti letia v helikoptére a jeden sa pýta druhého:\r\n"Čo je to nad nami, čo sa točí?"\r\n"To je ventilátor."\r\n"Áno? A ako si na to prišiel?"\r\n"Lebo keď sa prestal točiť, pilot sa začal potiť."', 208, 3.03, 36),
	(8310, 'Viete, prečo sa hovorí policajtovi, že je orgán?\r\nLebo to druhé je škaredé.', 82, 2.65, 36),
	(8311, 'Policajt přiběhne k telefoní budce, zvedne sluchátko a ptá se: \r\n- Kdo je nejchytřejší na světě?\r\n- Tý, tý, tý, tý!', 129, 3.03, 36),
	(8312, 'Ide žena po ulici v podnapitom stave. Zastaví ju policajt a vypýta si od nej občiansky preukaz. Pozrie sa na meno tej ženy a vráti jej preukaz. \r\n- Neporodili ste náhodou 25.5. pred tridsiatimi rokmi? \r\n- Áno, prečo? \r\n- Tak teda ahoj mami!', 249, 2.85, 36),
	(8313, 'Policajt v papiernictve:\r\n- Dobrý deň. Máte glóbus západoslovenského kraja?', 81, 2.87, 36),
	(8314, 'Policajna nemocnica: \r\nPolicajti chodia po chodbách oproti sebe. Zdravia sa a zdravia, až sa uzdravia.', 104, 2.98, 36),
	(8315, 'Viete prečo majú policajti pod čapicou feferónku?\r\nAby im to lepšie pálilo.', 81, 3.02, 36),
	(8316, 'Policajti sledujú Závod mieru:\r\n"To zas bude pokút! Toľko bicyklov a žiaden nemá osvetlenie"', 98, 2.94, 36),
	(8317, 'Kapitán zásahovej skupiny kričí na unavených chlapov:\r\n- Kto tu spí, nech zdvihne ruku!', 93, 3.14, 36),
	(8318, 'Z policajnej zápisnice:\r\nPoškodený bol zasiahnutý štyrmi výstrelmi. Dva boli smrteľné, ostatné našťastie nie.', 120, 3.04, 36),
	(8319, 'Policajt vyzve slečnu do tanca. Na jej prekvapený výraz v tvári sa pýta: \r\n- Aj vy si myslíte, že policajti sú hlúpi?\r\n- To by som si nedovolila, ale na hymnu som ešte netancovala!', 190, 2.94, 36),
	(8320, 'Náčelník polície sa pýta svojich podriadených:\r\n"Viete prečo vlak keď ide rachotí?"\r\nNikto nevie tak náčelník pokračuje.\r\n"Tak si to rozoberme. Čo je vlastne vlak? Vlak to je lokomotíva a vagóny. Vagóny sú ťahané lokomotívou takže tie odpíšeme. Ďalej. Čo je lokomotíva? Lokomotíva to je vlastne motor a kolesá. Čo ide po koľajniciach? Kolesá, takže motor odpíšeme. Kolesá sú vlastne kruhy takže nám stačí iba jeden. A kruh je vlastne pí er na druhú. Pí je konštanta tú odpíšeme, ostáva nám er na druhú. A čo je er na\r\ndruhú? No to je predsa štvorec. A čo robí štvorec keď sa kotúľa?\r\nNo predsa rachotí."', 664, 3.53, 36),
	(8321, 'Na diaľnici je hromadná dopravná nehoda. Po pol hodine sa prídu pozrieť policajti. Jeden vystúpi z auta a pýta sa: \r\n- Komu patrí tá modrá Škoda Favorit tam vpredu? \r\n- Mne, ale to je Forman. \r\nPolicajt:\r\n- To máte nejaké krátke, dajte si to reklamovať.', 268, 3.17, 36),
	(8322, 'Policajt zastaví auto:\r\n- Prekročili ste stovku pani!\r\n- To iba v tomto klobúku tak staro vyzerám.', 102, 3.13, 36),
	(8323, 'Pýta sa šéf polišov svojich dvoch podriadených:\r\n"Tak čo? Boli ste na tom pohrebe?"\r\n"Noo. Boli."\r\n"A správali ste sa slušne, tak ako som kázal?"\r\n"Noo. Správali."\r\n"Heej. Dobre. A ako bolo?"\r\n"Ale, všetci plakali. A nikto nechcel tancovať, len my dvaja."', 267, 2.86, 36),
	(8324, 'Policajt zastaví furmana a pýta sa ho čo vezie. Furman mu odpovedá, že orechovú salámu. Policajt ochutná. Odrazu zanadáva:\r\n"Do pekla, čo je to za humus?"\r\n"A čo ja viem! Hijó orech!"', 195, 2.77, 36),
	(8325, 'Policajt vyberá zápalky z krabičky a zapaľuje ich, samozrejme, opačnou stranou. Pritom ich odhadzuje a hovorí si:\r\n- Zlá, zlá, zlá ...\r\nAž mu mu jedna chytí. Sfúkne ju a odloží so slovami:\r\n- Tá je dobrá, tú si nechám!', 236, 3.43, 36),
	(8326, 'Vbehne rozradostený policajt do kancelárie a kričí:\r\n- Narodil sa my syn a je to chlapec.', 93, 3.03, 36),
	(8327, 'Na policajnej stanici:\r\n- Ten chlap sa tackal po celej ceste. Kým som ho zrazila, musela som niekoľko krát prudko strhnúť volant.', 134, 2.75, 36),
	(8328, 'Rozpravájú sa policajti. Jeden povie:\r\n"Rozrátal som si, že Silvester pripadne na piatok."\r\n"Len aby to nebolo trinásteho."', 128, 3.06, 36),
	(8329, 'Sedia dvaja policajti v noci v aute a odrazu tak vidia babku s ťažkými taškami, ako prechádza cez cestu. Obaja vyskočia z auta a babke pomôžu s taškami až domov. Pred domom babka zastane a hovorí:\r\n- Ja nie som obyčajná babka, ale čarovná babka a že ste mi pomohli, tak vám splním tri želania.\r\nPolicajti sa poradia a hovoria:\r\n- Chceme byť teraz na krásnej slnkom zaliatej pláži pri mori.\r\nWhooop ..... a zrazu obaja ležia na nádhernej pláži.\r\n- Chceme, aby okolo nás boli krásne nahé ženy.\r\nWhooop .... a okolo policajtov sa prechádza kopa nádherných nahých žien. Keď to policajti vidia, povzdychnú si:\r\n- Jaj, keby sme už nikdy v živote nemuseli viac pracovať!!!\r\nWhoooop ... a policajti sedia naspäť v policajnom aute.', 765, 2.93, 36),
	(8330, 'Viete, aké je najrýchlejšie zviera na svete?\r\nMotorizovaný policajt.', 72, 2.57, 36),
	(8331, 'Policajná hliadka našla na chodníku ležať tuleňa. Tak ho zobrali so sebou na policajnú stanicu:\r\n- Pán náčelník, našli sme ho na ulici, čo s ním?\r\n- Preboha, veď je to tuleň. Rýchle ho vezmite do ZOO!\r\nNa druhy deň ide náčelník domov a cestou stretne oboch polišov, ako ťahajú za sebou tuleňa:\r\n- Idioti, vravel som Vám, aby ste ho vzali do ZOO!\r\n- Tam sme boli včera. Dnes ideme do kina!', 415, 3.23, 36),
	(8332, 'Príde náčelník a oznámi svojmu zboru:\r\n- Chlapci, zajtra ideme na Figarovu svadbu.\r\nNa druhý deň prídu všetci v oblekoch a s kyticami. Náčelník im na to hovorí:\r\n- Preboha, načo ste si vy tupci doniesli kytice, nejdeme na ozajstnú svadbu, to je len opera.\r\nV tom sa ozve nesmelý hlas:\r\n- Ale, ale a ktože to minule prišiel na Labutie jazero s udicou?', 368, 3.34, 36),
	(8333, 'Cez križovatku na červenú preletí auto. Policajt ho samozrejme hneď zastaví \r\n- Pán vodič, viete, akého dopravného priestupku ste sa dopustili?\r\n- Ja viem pán policajt, ale viete - bol som u svokry, voľačo sme vypili a ešte mi treba auto dať do garáže.\r\n- Nóó, tak to pôjdete sa nami , pán vodič.\r\nDošli na políciu. Veliteľ sa informuje, čo sa deje.\r\n- Pán veliteľ, doviedol som  opitého vodiča - berieme ho na odber...\r\n- V poriadku - nech sa lúči s vodičákom...\r\nVodičovi dajú fúkať - a nič !!!  Urobia odber - úplne nič. Veliteľ sa zlostne obráti na policajta:\r\nTo ste ho načo doviedli, však je triezvy !!!\r\nDo debaty sa pripletie vodič:\r\n- Pán veliteľ, nič mu neverte, ten vám ešte začne rozprávať, že som hádam aj križovatku na červenú prešiel.', 809, 3.1, 36),
	(8334, 'Prechádzajú sa dvaja policajti po parku a jeden zrazu zhíkne: \r\n"Aha, našiel som stokorunáčku!"\r\nDruhý zvolá: \r\n"Fíha, ty máš ale šťastie !\r\nPo chvíli ju policajt roztrhá a zahodí.\r\n"Pre Boha, čo to robíš!"\r\n"Veď bola falošná!"\r\n"To si ako na to prišiel?"\r\n"To bolo predsa jednoduché. Stokorunáčka má dve nuly a nie tri!"', 348, 3.24, 36),
	(8335, 'Nastúpia dvaja policajti do autobusu.\r\nPrvý príde k strojčeku na lístky a cvakne si dva lístky.\r\nTen druhý sa ho spýta : \r\n"Prečo si si cvakol až dva lístky?"\r\nPrvý odpovedá:\r\n"To vieš istota. Čo ak by som jeden stratil?"\r\n"No jasné !", odpovedá druhý, no po chvíly sa opäť opýta:\r\n"Ty počúvaj. Ale čo budeš robiť, ak stratíš aj ten druhý lístok?"\r\nPrvý suveréne odpovedá:\r\n"V tom prípade použijem električenku!"', 449, 2.8, 36),
	(8336, 'Stojí policajt na križovatke.Zrazu okolo preletí auto na červenú.Policajt auto zastaví a vystúpi mladý študent. Policajt sa pýta:\r\n- Viete aký priestupok ste spravili pán vodič? Bude to pokuta 500 Sk.\r\nŠtudent ho prosí.\r\n- Pán policajt teraz nemám peniaze som len študent.Tento rok mám štátnice ked začnem pracovat určite vám tie peniaze prinesiem.\r\nPolicajt sa teda zľutuje a pustí ho bez pokuty.Študenta už viac nevidel.\r\nO rok neskôr:\r\nStojí policajt na križovatke.Zrazu preletí cez križovatku auto na červenú.Policajt ho zastaví.Vystúpi príťažlivá mladá slečna.\r\nPolicajt jej hovorí:\r\n-Viete aký dopravný prietupok ste spravili?Bude to za pokutu.\r\nSlečna sa bráni:\r\n- Pán policajt ja som len študentka nemám peniaze.Tento rok mám štátnice, začnem pracovať, potom vám tie peniaze prinesiem.\r\nPolicaj sa nedá a hovorí:\r\n-Drahá slečna, mna nedostanete, ja vám nenaletím, štátnice boli minulý rok.', 963, 3.25, 36),
	(8337, 'V policajnom aute dostali policajti vysielačku. A zrazu sa im začne hlásiť centrála. Prvý vraví druhému.\r\n- Ja som to ešte nikdy neobsluhoval. Čo mám robiť?\r\n- To je jednoduché. Stlač červené tlačítko a povedz *Príjem*.\r\nPolicaj stlačí tlačítko a povie:\r\n- 8600 korún čistého.', 302, 3.18, 36),
	(8338, 'Idú po ulici dve ceruzky.Ktorá z nich je policajná?.\r\nTa tupá.', 66, 3.18, 36),
	(8339, 'Viete prečo majú policajti dlhé biele rukavice pri riadení cestnej premávky?\r\nTo aby vedeli, kde majú ohýbať ruky.', 122, 2.98, 36),
	(8340, 'Policajti majú skúšku z matematiky. Jeden z nich vraví: \r\n"Ja to asi nespravím". \r\n"Ale prečo?", pýta sa ho druhý "Vari nevieš sčitovať a odčitovať?"\r\n"Veď práve. Nechápem ako je to možné, že 5-7+2=0"\r\n"Veď to je jednoduché. Ja ti to vysvetlím. V autobuse cestuje päť ľudí. Na zastávke sedem vystúpi, koľkí musia nastúpiť, aby tam nikto nebol?"', 376, 3.17, 36),
	(8341, 'Prečo policajné dieťa plače na pieskovisku ked si vykope jamu?\r\nLebo si ju nemože odniesť domov!', 102, 3.04, 36),
	(8342, 'Jeden sa pýta policajta:\r\n"Vieš, aký je rozdiel medzi policajtom a oslom?"\r\n"Neviem. No povedz, aký?"\r\n"Žiaden!"\r\n"Veď preto!"', 132, 3.03, 36),
	(8343, 'Príde policajt do obuvi a pýta si topánky. Predavačka sa pýta:\r\n"Aké máte číslo?" \r\n"Predsa 158!"', 106, 2.93, 36),
	(8344, 'Policajt ide po ulici a nájde zrkadlo.Zoberie si ho a ide domov. Dcéra mu ho vytiahne a hovorí:\r\n"Mama, otec má milenku."\r\nŽena zoberie zrkadlo a hovorí:\r\n"A akú škaredú."', 180, 3.16, 36),
	(8345, 'Pýtajú sa policajta:\r\n- Vieš čo je to? Dáva to mlieko a poskytuje to aj rozkoš.\r\nPolicajt celý natešený odpovedá:\r\n- Krava.', 133, 3.01, 36),
	(8346, 'Vrátia sa dvaja policajti z nočnej pochôdzky na  strážnicu a náčelník sa ich hneď opýta :\r\n- Tak čo, chlapci, je všetko v poriadku?\r\n- Áno, v poriadku. Aj Gizela stála na tom  istom rohu ako každý večer.\r\n- Dobre chlapci, ale dúfam, že ste ju ignorovali!\r\n- Áno náčelník. Ja dvakrát a Fero raz.', 318, 3.16, 36),
	(8347, 'Prečo chodia policajti vždy dvaja?\r\nLebo jeden nikdy nevie...', 63, 2.9, 36),
	(8348, 'Naskočí polda do tramvaje a zařve:\r\n"Sledujte ten taxíííííík!"', 71, 3.25, 36),
	(8349, 'Ide policajt po ulici a mudruje: \r\n"Myslím, teda som." \r\nA v tom zmizne.', 73, 3.09, 36),
	(8350, 'Ide policajt v autobuse a vedľa neho sedí nádherná žena. Chce s ňou nadviazať rozhovor a tak sa osmelí a spýta sa jej:\r\n"Slečna, aj vy cestujete týmto autobusom?"', 173, 3.21, 36),
	(8351, 'Začala horieť policajná stanica. Policajti boli nútení vyjsť až na strechu. Keď prišli hasiči, natiahli plachtu a policajti začali po jednom skákať. Ale vždy keď bol už policajt tesne nad zemou, tak plachtu odtiahli a hrozne sa na tom zabávali. Až prišiel na rad posledný - náčelník. Ten, vidiac podraz, vytiahol revolver namieril na hasičov a povedal:\r\n"So mnou nevybabrete, plachtu na zem a všetci tri kroky dozadu!"', 443, 3.32, 36),
	(8352, 'Dvaja policajti si založili zelovoc.\r\n"Teraz si vyskúšame ako bude náš zelovoc fungovať." - hovorí prvý.\r\n"Ty budeš zákazník a ja predavač."\r\n"Dobre,prosím si tri litre zemiakov." - hovorí druhý.\r\n"Zapamätaj si, že zemiaky sa predávajú na kilá."\r\n"Dobre,tak si prosím tri kilá zemiakov." - hovorí druhý.\r\n"A fľašu ste si priniesli" - povie prvý.', 372, 2.92, 36),
	(8353, '- Dobrý deň, cestná kontrola. Máte u seba vodičký preukaz?\r\n- Mám. Mám vám ho ukázať?\r\n- Netreba. Ukázať ho musia tí, čo ho nemajú.', 147, 2.9, 36),
	(8354, 'Policajt príde domov, pozrie do chladničky a zmláti ženu.\r\nTakto to ide už tri dni. Žena to nevydrží a opýta sa, prečo ju po tri dni mláti ako pri policajnej akcii.\r\n"Koľkokrát som ti povedal, aby si v chladničke zhasínala svetlo?"', 246, 3.05, 36),
	(8355, 'Žena má doma milenca, keď príde manžel - policajt. Manželka ledva skryla milenca pod perinu, keď do spálne vošiel manžel. Povyzliekal sa a hneď si ľahol do postele. Niečo sa mu nezdá, tak\r\nzačne rátat nohy: \r\n" 1,2,3,4,5,6!"\r\nTo ho strašne rozčúlilo, vstane a počíta ešte raz:\r\n" 1,2,3,4. No veď preto!"', 326, 3.23, 36),
	(8356, 'Prečo policajti nosia v aute vždy zo sebou truhlu?\r\nAby do nej dali motor keď im zdochne.', 92, 2.97, 36),
	(8357, 'Policajt sa pýta tuláka:\r\n- Kde bývate?\r\n- Nikde - odpovedá tulák.\r\n- A vy? - obráti sa policajt na druhého.\r\n- Tiež nikde, my sme susedia.', 147, 2.72, 36),
	(8358, 'Na lekárskej prehliadke policajtov zahlási vyšetrujúci lekár:\r\n- Vstupujte po štyroch! \r\nVtom sa všetci policajti dali na kolená a vstupovali dovnútra!', 160, 2.99, 36),
	(8359, 'Ide policajt s manželkou do divadla, po pol hodine sa vrátia a svokra sa ich pýta:\r\n"A čože tak skoro?"\r\n"Ále, v programe bolo napísané, že druhé dejstvo sa odohráva o 2 roky."', 187, 3.21, 36),
	(8360, 'Jeden policajt sa pýta druhého:\r\n"Ako skončil včerajší zápas?"\r\n"0:0"\r\n"A prvý polčas?"\r\n"Neviem, ten som nepozeral."', 126, 2.94, 36),
	(8361, 'Zamestnanec na policajnej stanici sa pýta policajta:\r\n- Šéfe, nechcete pol prasaťa?\r\n- A načo by mi bolo, však by sa mi v chlieve prekotilo.', 146, 2.99, 36),
	(8362, 'Príde policajt do lesa a vidí odstavené auto. Pýta sa:\r\n- Je tu majiteľ auta BA 680?\r\nVodič z lesa kričí:\r\n- Ááááánooo!\r\n- A máte papiere?\r\n- Nie, stačia mi lopúchy.', 181, 2.74, 36),
	(8363, 'Jožo hovorí:\r\n- Hovorili ste, že svadobná noc bude krásna, ale celú noc som sa pozeral z okna, ale nič zaujímavé som tam nevidel.', 138, 2.85, 36),
	(8364, 'Policajti sú privolaní k autonehode. Nikto neprežil. Jeden z nich sa poškriabe za uchom a vraví: \r\n- Hm, hm. Všetci mŕtvi. A kto potom šoféroval?', 154, 3.13, 36),
	(8365, 'Príde budúci policajt na konkurz a náčelník sa ho pýta:\r\n- Viete písať?\r\n- Viem. \r\n- Viete čítať?\r\n- Viem.\r\n- A naučili by ste ma to?', 145, 3.03, 36),
	(8366, 'Po ulici ide policajt a hundre si popod nos: \r\n- Ešte dvadsať krokov a poseriem sa.\r\nO chvíľu zasa:\r\n- Ešte päť krokov a poseriem sa! \r\n- No, boha, čo hovorím?!', 169, 3.13, 36),
	(8367, 'Dvaja policajti: \r\n- Povedz jež!\r\n- Jež!\r\n- Do zadku bež!\r\n- Hahaha. To je super, to poviem doma žene!\r\nPolicajt príde domov, a povie manželke:\r\n- Povedz jež!\r\n- Jež!\r\n- Choď do zadku! Hahaha.', 201, 3.34, 36),
	(8368, 'To přišel cikán na policejní stanici, že by se rád stal policajtem. I tak si ho zavolal k sobě náčelník, že mu položí nejaké otázky. I zeptal se, kdo napsal Reportáž psanou na oprátce. Cikán přemýšlí a v tom zazvoní telefon a náčelník musí odejít. Předá tedy cikána svým podřízeným, že má říct, kdo napsal Reportáž psanou na oprátce. Po hodině se náčelník vráti a vidí cikána ležet v rohu, zbitého do krve. Náčelník se ptá, cože se to tu dělo. \r\n"Už se přiznal, napsal to s bráchou."', 544, 3.4, 36),
	(8369, 'Dvaja českí policajti lúštia krížovku. Majú uhádnuť meno horolezca na päť písmen. Ide okolo veliteľ. \r\n"Pán veliteľ" - pýta sa jeden z nich - "horolezec na päť písmen, neviete?"\r\n"To bude oný...ten...Boriš!"- odpovedá veliteľ.\r\n"Boriš, správne, sedí to! Teda pán veliteľ, vy viete všetko!" - chvália veliteľa policajti.\r\n"Chlapi, to je také jednoduché" - hovorí veliteľ - " veď sa o ňom spieva aj v tej známej pesničke ... Boriš umí po skalinách!!!"', 491, 3.31, 36),
	(8370, 'Príde policajt do obchodu a ide si kúpiť šiltovku. Vyskúša si tri a napokon povie: \r\n- A taká zo šiltom dozadu by sa nenašla?', 134, 3.12, 36),
	(8371, 'Hovorí jeden policajt druhému:\r\n- Ten náš šéf je ale riadny pako!\r\n- A prečo by mal byť pako?\r\n- Kázal mi kúpiť bublinku do vodováhy.\r\n- No a?\r\n- Veď v nedeľu sú všetky obchody zatvorené.', 204, 3.09, 36),
	(8372, 'Policajt na Záhorí zastaví vodiča a hovorí mu :\r\n- Pán vodič , nesvietia Vám heligóny!\r\nVodič mu na to:\r\n- To niesú heligóny, ale halogény.\r\nPolicajt chvíľu porozmýšla a hovorí:\r\n- Počúvaj, nezdá sa ti , že si nejaký suterén?', 249, 3.24, 36),
	(8373, 'Policajt stretne ujčeka, ako ide so somárom a károu cez dedinu. V káre má plný sud nejakej tekutiny.\r\n"Čo to máte, ujček?"\r\n"Banánovu sťavu."\r\n"Dajte mi ochutnať."\r\n"Nedbám."\r\n"Fúúj! Odporné! hovorí policajt."\r\n"Nevadí. Hijó Banán."', 252, 3.27, 36),
	(8374, '- Počul si o havárii, ktorá sa stala pri komíne mestskej teplárne? \r\n- A čo sa stalo?\r\n- Hneď vedľa komína spadol policajný vrtuľník.\r\n- A ako sa to stalo?\r\n- V noci čakal až mu naskočí zelená a zatiaľ mu došlo palivo.', 237, 3.02, 36),
	(8375, 'Policajt hovorí policajtovi:\r\n"Poď k nám, ukážem Ti, akého mám sprostého syna."\r\nPrídu domov a policajt hovorí:\r\n"Nože, synak, choď sa pozrieť do roboty, či tam nie som!"\r\nSyn sa obliekol a odišiel. Druhý policajt nechápavo pozerá a hovorí:\r\n"A to si nemohol radšej sám zavolať?"', 301, 3.37, 36),
	(8376, 'U policajta zazvoní zvonček pri dverách."Kto je tam?"\r\n"Ja!"\r\n"Ja?!"', 71, 3.16, 36),
	(8377, 'Príde policajt na verejné WC, skúša otvoriť jednu z kabínok, no nejde mu to. Tak sa slušne spýta:\r\n- Prosím vás, je tam niekto?\r\nZ kabínky sa ozve:\r\n- Áno, ja!\r\nPolicaj neveriacky pozrie na seba a potichu si povie:\r\n- JA?', 233, 2.65, 36),
	(8378, 'Zaverečná veľká skúška u policajtov.Otvoria sa veľké dvere a vstúpi do nich budúci policajt Michal. Na stene zbadá obraz človeka z profilu. Skúšajúci policajt ukazuje na obraz a pýta sa:\r\n- Čo je na tomto obraze zvláštne.\r\nMichal sa zadíva a nakoniec hovorí:\r\n- Muž na ňom má iba jedno ucho.\r\nPolicajt sa veľmi rozčúli a vyhodí ho z miestnosti.\r\nVojde druhý, Paľo a policajt mu položí tú istú otázku. Paľo sa zahľadí a odpovedá:\r\n- Má iba jedno ucho.\r\nPolicajt ho vyhodí z miestnosti. Keď Paľo prechádza okolo tretieho nádejného policajta, hovorí mu:\r\n- Prosím ťa povedz hocičo len nie to, že má iba jedno ucho.\r\nVojde a policajt mu položí znova tú istú otázku ako Mišovi a Paľovi. Muž bez váhania odpovedá:\r\n- Človek na obraze má kontaktné šošovky.\r\n- Výborne, ako ste na to prišli?\r\n- No, okuliare by mu spadli, keď má iba jedno ucho.', 907, 3.38, 36),
	(8379, 'Policajt vstúpi do knižnice. Knihovníčka sa ho pýta: \r\n- Ale čo, vonku prší?', 84, 3.22, 36),
	(8380, 'Achmed volá na políciu a kričí.\r\n- Pán detektív, Dežovi doviezli na mercedese drevo.\r\nDetektív sa opýta:\r\n- No čo ja s tým?\r\n- No ale v tom dreve sú drogy.\r\nDetektív rozhorčene povie:\r\n- Hneď sme tam.\r\nAchmed volá Dežovi:\r\n- Vieš, minule som ti vybavil partiu, čo ti prerýľovala záhradu, tá istá ti dnes porúbe drevo.', 342, 3.14, 36),
	(8381, 'V meste sa stala krádež. Páchateľa našli, ale nechcel sa priznať, preto zavolali miestneho špecialistu, aby ho vypočúval. Ten sa ho všeličo pýtal, ale páchateľ sa nepriznával. Nakoniec mu vraví:\r\n- Aj tak vieme, že ste to boli vy! Na mieste činu sme našli vaše otlačky prstov. \r\n- Klamete! Mal som rukavice. ', 329, 2.89, 36),
	(8382, 'Na policajnej stanici zvoní telefón:\r\n- Haló, je tam číslo 44 44 4?\r\n- Nie, tu je číslo 4 44 44!', 103, 2.97, 36),
	(8383, 'Dvaja policajti robia zápisnicu po vražde:\r\n- S akým I sa píše KINO?\r\n- Neviem. Tak ho odtiahnime pred TESCO.', 114, 3.04, 36),
	(8384, 'Prechádzajú sa dvaja policajti a jeden z nich povie:\r\n- Som múdry.\r\nDruhý sa ho pýta:\r\n- A prečo?\r\n- Lebo som kúpil synovi skladačku!\r\n- A preto si múdry?\r\n- Ale nie preto!\r\n- Tak prečo!\r\n- Lebo som ju poskladal za jediný rok, hoci na obale bolo napísané - od 3 do 5 rokov !!!', 289, 3.25, 36),
	(8385, 'Idú traja policajti po chodníku. Jeden si kýchne. \r\nDruhý mu povie:\r\n"Na zdravie!"\r\nA tretí povie:\r\n"A mne nenalejete?"', 124, 3.12, 36),
	(8386, 'Policajt v akcii:\r\n- Pán vodič, vystúpte si. Nesvieti vám pravý heligón.\r\n- Hádam halogén, nie?\r\n- Pán vodič, vy ste nejaký suvenír.\r\n- Hádam suverén, nie?\r\n- Pán vodič, dávajte si bacha, lebo používať cudzie termity je niekedy rizoto.', 255, 3.24, 36),
	(8387, 'Sedia dvaja policajti v aute a jeden sa pýta druhého: \r\n- Pozri, či nám bliká siréna!\r\nPolicajt teda stiahne okienko vykukne von a hovorí:\r\n- Bliká... nebliká... bliká... nebliká... bliká... nebliká.', 212, 3.2, 36),
	(8388, 'Zastaví policajt auto a vraví vodičovi:\r\n\'Pán vodič, už piatykrát vás zastavujem a už piatykrát vás upozorňujem, že vám z auta tečie voda!!!\'\r\nVodič mu na to odpovie:\r\n\'Pán policajt, ja vám už piatykrát hovorím, že toto je polievacie auto!?\'', 263, 3.27, 36),
	(8389, 'Prečo sa policajti pri búrke usmievajú? \r\nLebo si myslia, že ich niekto fotografuje.', 88, 2.77, 36),
	(8390, 'Idú dvaja policajti autom a jeden hovorí druhému:\r\n- Prosím ťa zastav, musím sa vysrať.\r\nTak mu zastaví. Ide do kríkov, urobí si potrebu a príde naspäť do auta a hovorí:\r\n- Počuj nemáš papier?\r\n- Čo si sprostý? Načo to chceš baliť, však to nechaj tam.', 274, 3.27, 36),
	(8391, 'U policajtov na záverečných skúškach. Skúšajúci sa pýta: \r\n- Predstavte si, že idete po parku, zrazu k vám pribehne nádherná mladá žena a kričí "Práve som bola znásilnená!" Čo urobíte?\r\nMladý policajt: \r\n- Ihneď vykonám rekonštrukciu zločinu!', 269, 3.07, 36),
	(8392, 'Policajt sa obhajuje na súde. Sudca sa ho pýta:\r\n- Povedzte nám všetko ešte raz o tom, ako ste zabili svokru.\r\nPolicajt povie:\r\n- Takže manželka išla nakupovať a povedala mi, že svokra leží na verande a keby náhodou na ňu sadla mucha, tak ju zabi.', 261, 3.44, 36),
	(8393, 'Ide policajt v noci po parku a z kríka počuje vzdychy. \r\n- Čo tam robíte?\r\n- Milujem sa, ozve sa z kríka mužský hlas.\r\n- 100 korún pokuty - hovorí policajt.\r\n- Za čo? - zaznie ženský hlas.\r\n- Aha, tak vy ste dvaja, tak to bude za 200.', 246, 3.18, 36),
	(8394, 'Prečo sedia v policajnom aute vždy dvaja policajti? \r\nJeden pozná cestu tam, druhý späť.', 94, 3.14, 36),
	(8395, 'Policajt sa miluje so svojou ženou a ona pri tom veľmi kričí. Policajt sa pýta: \r\n- Bolí? \r\nA žena odpovedá:\r\n- Nie, práve naopak. \r\nPolicajt: \r\n- Ílob?', 162, 3.3, 36),
	(8396, 'Policajt zastaví auto a hovorí vodičovi:\r\n- Pán vodič, vaše auto je preťažené, musím vám odobrať vodičské oprávnenie.\r\nVodič na to:\r\n- Kľudne, ale váži nanajvýš dvadsať gramov.', 198, 2.72, 36),
	(8397, 'Idú dvaja policajti po ulici a nájdu hlavu. Jeden ju zdvihne, poobzerá a hovorí:\r\n"Ty, nemohol by to byť Fero?"\r\n"Ale kde, Fero bol vyšší."', 147, 3.07, 36),
	(8398, 'Policajt si vyseká dieru do ľadu, vloží udicu a čaká...\r\nO chvíľu k nemu pribehne chlapík a kričí:\r\n"Okamžite vypadnite."\r\n"A mohli by ste mi povedať, z akého titulu?"\r\n"Z titulu správcu zimného štadióna."', 223, 3.18, 36),
	(8399, 'Príde policajt do reštaurácie. Čašníčka sa ho pýta, čo si dá. Policajt hovorí:\r\n- Dám si hranolky.\r\n- Prepáčte, ale došli nám zemiaky.\r\nPolicajt na to:\r\n- To mi nevadí, ja ich zjem aj s chlebom.', 211, 3.09, 36),
	(8400, 'Učiteľka dieťaťa, ktorého otec je policajt povedala tomu decku, že by mal ísť radšej na osobitnú školu. Doma sa pýta decko otca-policajta:\r\n"Oci, môžem ísť na tú školu?"\r\n"No pozri, keď na to máš!"', 218, 3.4, 36),
	(8401, 'Volá chlap na policajnú stanicu.\r\nchlap: Pppprossím vvás pppríddte kk nnám oodttiahhnuťť zzzdochnnuttého kkoňňa!\r\npolicajt: A kde je ten kôň?\r\nchlap: Na va va va va va ...\r\npolicajt: Na václaváku?\r\nchlap: Nnie na va va va va ...\r\npolicajt Zloží slúchadlo.\r\nNa druhý deň volá chlap.\r\nchlap:  Pppprossím vvás pppríddte kk nnám oodttiahhnuťť zzzdochnnuttého kkoňňa!\r\npolicajt: A kde je ten kôň?\r\nchlap: Na va va va va va ...\r\npolicajt: Na václaváku?\r\nchlap: Nnie na va va va va ...\r\npolicajt Zloží slúchadlo.\r\nTakto sa to zopakuje ešte raz.\r\nNa štvrtý deň volá chlap zas.\r\nchlap:  Pppprossím vvás pppríddte kk nnám oodttiahhnuťť zzzdochnnuttého kkoňňa!\r\npolicajt: A kde je ten kôň?\r\nchlap: Na va va va va va ...\r\npolicajt: Na václavaku?\r\nchlap: Uuž som  hho tttam ooodtttiahhol vy kkretténi !!!', 847, 3.33, 36),
	(8402, 'Dvaja policajti čúraju za rohom. Keď dokončia pozerá jeden na druhého a vidí, že ten má nohavice celé počúrané.\r\n- Ty hovädo, zasa si držal pendrek...', 165, 3.28, 36),
	(8403, 'Jeden policajt kupuje od druhého policajta záhradu:\r\n- Tá záhrada je veľmi pekná, ale je moc dlhá. \r\n- Ale neblbni. Sem dáš kapustu, tu mrkvu a tam sliepky.\r\n- No tak dobre.\r\nPo dlhom čase sa stretnú:\r\n- Tak čo záhrada?\r\n- No... dobrá kapusta, veľká mrkva po pás, len tie sliepky neviem, či som ich dobre hlboko zasadil.     ', 343, 3.26, 36),
	(8404, 'Ide policajt reklamovať televízor a hovorí: \r\n- Sedím si pri televízore, špáram si s klincom v uchu a naraz prásk a nejde zvuk. ', 136, 3.28, 36),
	(8405, 'Zastaví policajt vodiča a po kontrole dokladov sa ho pýta: \r\n- Čo to máte vzadu na sedačke?\r\nVodič odpovedá:\r\n- Termosku.\r\n- Termosku? A to je čo?\r\n- To je taká vec, do ktorej keď vložíte niečo horúce, zostane to horúce, alebo niečo studené, tak to studené zostane.\r\nNa druhý deň si policajt kúpi termosku a stretne ho jeho kolega, ktorý sa začudovane pýta:\r\n- Čo to máš?\r\n- Ale termosku.\r\n- A to je čo?\r\n- No to je taká vec, do ktorej keď dáš niečo horúce, tak to horúce zostane a ak tam dáš niečo studené, tak to studené zostane.\r\nA ty máš čo v tej termoske?\r\nTeplý čaj a dva nanuky.', 631, 3.25, 36),
	(8406, 'Ide farár autom a zastavia ho policajti.\r\n- Pán farár, čo to veziete?\r\n- Mám v kufri bojler.\r\nPolicajti ho nechali odísť a potom s a rozprávajú:\r\n- Nevieš, čo je to bojler?\r\n- No neviem, ja som nechodil na náboženstvo.', 231, 3.2, 36),
	(8407, 'Policajt pri rutinnej kontrole automobilu: \r\n- Pán vodič, čo to máte v tom kufri?\r\n- Polovicu prasaťa.\r\n- A živého alebo mŕtveho?', 137, 3.3, 36),
	(8408, 'Policajt zastaví auto za prekročenie rýchlosti:\r\n- Dobrý deň, vodičský preukaz!\r\n- Nemám, zobrali mi ho pred polrokom.\r\n- Čože? Vy nemáte vodičák? Tak osvedčenie o technickom stave vozidla.\r\n- Ani to nemám. Viete, auto som ukradol a myslel som, že bude v skrinke, ale keď som tam dával tu pištol, tak som zistil, že tam nie je.\r\n- Čože vy tu máte pištol? \r\n- Áno tú, čo som s ňou zastrelil tú babku, čo jej patrilo toto auto. Ju som dal do kufra.\r\nTo už je na policajta veľa, tak zavolá náčelníka. Ten príde k šoférovi, skontroluje vodičák - v poriadku, techničák - v poriadku, otvorí skrinku - žiadna pištol tam nie je, otvorí kufor - ten je prázdny. Tak sa ospravedlňuje:\r\n- Prepáčte, ale ten policajt, čo Vás zastavil tvrdil, že nemáte vodičák, jazdíte v ukradnutom aute, že ste ozbrojený a v kufri máte mŕtvolu. Nechápem to.\r\n- No a stavil by som sa, že ten hajzel ešte aj tvrdil, že som prekročil rýchlosť.', 980, 3.6, 36),
	(8409, 'V kine jeden policajt hovorí druhému:\r\n- O chvíľu príde happy end.\r\nDruhý nato:\r\n- Dúfam, že si nesadne pred nás!!!', 124, 3.21, 36),
	(8410, 'Čo majú policajti napísané na náhrobnom kameni?\r\nTu odpočúva v pokoji.', 77, 3.19, 36),
	(8411, 'Dvaja policajti robia ochranku pri nakrúcaní filmu. Jeden z nich sa pýta: \r\n"Počúvaj, prečo tie scénky musia toľkokrát opakovať?"\r\nTen múdrejší mu odpovedá: \r\n"A čo ty vieš koľko je na svete kín?"', 214, 3.21, 36),
	(8412, '- Viete prečo majú policajti biele čapice?\r\n- Predsa každý hajzel má aj poklop.', 85, 3.69, 36),
	(8413, 'Pýta sa jeden policajt druhého:\r\n"Počuj, bol si ty už na Štrbskom Plese?"\r\n"Nie, ja chodím len na NÁŠ a na HASIČSKÝ."              ', 141, 3.5, 36),
	(8414, 'Stretnú sa dvaja policajti a jeden hovorí druhému:\r\n"Bol som včera u doktora na zistenie otcovstva. Predstav si, bral mi krv, ale neviem prečo z prsta?!"              ', 172, 3.75, 36),
	(8415, 'Jeden policajt hovorí druhému:\r\n"Ty, neuveríš, čo som včera videl. Slepý chlap si čítal časopis."\r\n"Ale nevrav, určite si iba pozeral obrázky."              ', 169, 4, 36),
	(8416, 'Policajt lúšti krížovku a pýta sa kolegov:\r\n"Chlapi, ako sa povie ženský pohlavný orgán na štyri?"\r\n"A je to vodorovne alebo zvislo?"\r\n"Vodorovne."\r\n"Tak to bude HUBA."              ', 192, 3.2, 36),
	(8417, 'Viete prečo policajt stále otvára a zatvára fľašku od Coca-Coly? \r\nLebo na vrchnáčiku je napísané "Skús to znova".              ', 139, 3, 36),
	(8418, 'Idú dvaja policajti po ZOO.\r\nJeden z nich uvidí ťavu a vraví tomu druhému:\r\n"Kukaj tu, ako zbili koňa."              ', 123, 3.67, 36),
	(8419, 'Idú traja policajti a zrazu ponad nich preletia tri lietadlá. Veliteľ im hovorí:\r\n"Aha, chlapci, tryskáče."\r\nO chvíľu letia späť už iba dve lietadlá a jeden z nich kričí:\r\n"Veliteľ, aha, dvaskáče."              ', 228, 3.96, 36),
	(8420, 'Dvaja policajti sa rozprávajú a jeden sa pýta:\r\n"Ako je to podľa teba, že slnko zapadá každý večer?"\r\nDruhý odpovedá:\r\n"Podľa mňa nezapadá, iba ho nevidieť, lebo je tma."              ', 199, 3.5, 36),
	(8421, 'Na policajnej akadémii prijímajú nových uchádzačov. Pýtajú sa jedného, koľko je 4 plus 4.\r\n"12."\r\n"Výborne, ste prijatý. Povedali ste nám viac, ako sme od vás očakávali."\n', 187, 4.08, 36),
	(8422, 'Dvaja policajti idú po lese a jedného poštípe had.\r\nDruhý hovorí: "Neboj sa, vyliečim ťa, čítal som o tom. Najskôr sa musíš vysrať."\r\n"Prečo? Veď ma poštípal had???"\r\n"Vyser sa a neodvrávaj!!!", poslúchol a vysral sa.\r\n"Tak a teraz to musíš zjesť!!!"\r\n"No to teda ani za boha!!!"\r\n"Zožer to!!!!" poslúchol a zožral to. Potom zdravý policajt vezme do ruky pištoľ, vystrelí do vzduchu a hovorí:\r\n"Už by si mal byť zdravý, v knižke písali, že je treba užiť sérum a vypáliť ranu."\n', 519, 3.9, 36),
	(8423, 'Viete prečo nechavaju policajti otvorene dvere pri štartovaní ? \r\nAby naskočil motor.              ', 103, 2.75, 36),
	(8424, 'Policajt hovorí druhému policajtovi:\r\n"Poď k nám, ukážem ti akého mám sprostého syna."\r\nPrídu domov a policajt hovorí:\r\n"Nože, synak, choď sa pozrieť do roboty, či tam nie som!"\r\nSyn sa obliekol a odišiel. Druhý policajt nechápavo pozerá a hovorí:\r\n"A to si nemohol radšej zavolať a opýtať sa?"\n', 319, 3.8, 36),
	(8425, 'Dvaja policajti nemali kde bývať, a tak si kúpili dva vyradené spacie vagóny.\r\n"Ja to mám celkom dobré," hovorí prvý, "ale mám na vagóne napísané Nefajčiť, a tak musím chodiť fajčiť von.\r\n"Ty sa máš," na to druhý, "to ja mám na záchode nápis Používajte len za jazdy a než ten vagón roztlačím, tak sa väčšinou vždy poseriem!"              ', 373, 3.86, 36),
	(8426, 'Bavia sa dvaja mladíci:\r\n"A vieš, aký je rozdiel medzi policajtom a debilom?"\r\nZrazu sa spoza rohu vynorí policajt: "No, aký, aký??", pýta sa policajt.\r\n"Žiadny."\r\n"No preto!"              ', 197, 4.11, 36),
	(8427, 'Policajti majú výplatu, nadporučík volá podľa mena: "Novák!"\r\n"Tu!"\r\n"24.800 Sk" a Novák si ide pre prachy.\r\n"Mrkvička!"\r\n"Tu!"\r\n"25.200 Sk" a Mrkvička si ide pre prachy.\r\n"Súčet!" Nikto sa nehlási.\r\n"Súčet!!!" Zase ticho.\r\n"To je blbec, má tu 183.400 Sk a nechce si to vybrať..."              ', 311, 3, 36),
	(8428, 'Policajt vodičovi:\r\n"Vy ste nejaký múdry."\r\n"Kto, ja?"\r\n"No snáď nie ja?!"              ', 93, 3.57, 36),
	(8429, 'Colník sa pýta vodiča autobusu:\r\n"Cigarety, alkohol, drogy?"\r\n"Kávu prosím."              ', 95, 3.93, 36),
	(8430, 'Viete, prečo majú policajné autá na dverách zelený pásik?\r\nAby policajti vedeli kadiaľ majú nastúpiť.\r\nA viete, prečo ho majú okolo celého auta?\r\nAby to nemali také ľahké.\n', 189, 3.5, 36),
	(8431, 'Nastúpil Fero k polícii. Robí tam mesiac, dva, tri a po výplatu si nechodí. \r\nZastavil ho náčelník:\r\n"Fero, prečo si si nebol už tri mesiace po výplatu?"\r\n"Po výplatu?" čuduje sa Fero. "Ja som si myslel, vyfasoval si pištoľ chlapče, obracaj sa ako vieš!"\n', 272, 3.43, 36),
	(8432, 'Cestná kontrola. Policajt stojí so šoférom pred autom a hovorí:\r\n"Pán vodič, nesvieti vám heligón!"\r\n"Mysleli ste halogén, nie?"\r\n"Nie ste vy nejaký suvenír?"\n', 171, 3.88, 36),
	(8433, 'Policajti nájdu tri granáty. Jeden z nich si ich začne hádzať v ruke. Jeho kolega mu hovorí, aby prestal lebo mu jeden z nich buchne.\r\nOn na to:\r\n"Nevadí, povieme, že sme našli len dva."\n', 196, 2.8, 36),
	(8434, 'Hovorí policajt kolegovi:\r\n"Včera som kúpil záchodovú kefu."\r\n"No a, aká je?"\r\n"Toaletný papier bol lepší."              ', 130, 4, 36),
	(8435, 'Policajt našiel na ceste tuleňa, tak ho zobral na policajnú stanicu a šéfovi podá o tom hlásenie. Šéf mu na to: "Zoberte ho do ZOO!" \r\nNa druhý deň policajt príde s tuleňom znova na stanicu, šéf sa ho pýta: "Čo ty zase s tým tuleňom?" \r\n"Dnes ideme do kina!"              ', 291, 3.8, 36),
	(8436, 'Do policajného zboru prijali nového policajta. Pred nástupom do služby si ho predvolal náčelník.\r\n"Hlavne si zapamätaj, že strieľať do ľudí je u nás zakázané!"\r\n"A v ktorých mesiacoch?"              ', 216, 2.6, 36),
	(8437, 'Viete, prečo nosia policajti vždy pri sebe nožík?\r\nAby mohli zlodejom odrezať cestu.              ', 103, 3.23, 36),
	(8438, 'Vyplňuje policajt krížovku a zrazu sa obráti na kolegu a pýta sa:\r\n"Ako sa povie ženský pohlavný orgán na štyri písmená?"\r\nKolega sa zamyslí a pýta sa: \r\n"Vodorovne alebo zvislo?"\r\n"Vodorovne" hovorí policajt.\r\n"No tak to sú ústa" odpovie kolega.              ', 277, 3.75, 36),
	(8439, 'Viete prečo nosia policajti čiapky?\r\nLebo každý zachod má poklop.              ', 84, 3.13, 36),
	(8440, 'Policajt zastaví auto a hovorí:\r\n- Prosím si váš vodičský preukaz.\r\nA vodič na to:\r\n- Ja naozaj nechápem, ako to máte v tom vašom systéme vymyslené. Veď pred chvíľou mi ho váš kolega zobral.              ', 222, 3.8, 36),
	(8441, 'Prečo majú policajti v aute chladničku?\r\nAby zachovali chladnú hlavu.              ', 87, 3, 36),
	(8442, 'Taxikár je vypočúvaný na polícii. "Máme dokázané, že ste boli v bezprostrednej blízkosti v čase, keď niekoľko výtržníkov bilo policajta. Prečo ste sa nečinne prizerali?" "To je ťažké, ja nemám nič proti policajtom."              ', 252, 3.33, 36),
	(8443, 'Policajti sú na vyšetrení u doktora. Doktor vyjde z dverí a vraví: \r\n- Je vás tu veľa, to by sme tu boli do večera. Musíte chodiť po štyroch. \r\nTak náčelník prikývne, že je mu všetko jasné, padne na kolená \r\na vraví: \r\n- Tak ja idem prvý.              ', 273, 3.9, 36),
	(8444, 'V bratislavskej nemocnici stavajú nový pavilón pre policajtov. Kruhový, vnútri okolo steny je len chodník a nič viac. Pacienti budú chodiť dookola a zdraviť. Až sa uzdravia.              ', 198, 3.9, 36),
	(8445, 'Policajt hádže do žihľavy papiere. Príde k nemu strážmajster a vraví: \r\n- Prečo hádžeš tie papiere do žihľavy? \r\n- Veliteľ mi nariadil, aby som tie tajné dokumenty spálil...              ', 204, 4, 36),
	(8446, 'Viete, prečo policajti nosia pištoľ? \r\nAby sa mohli brániť, keď ich niečo napadne.              ', 103, 3, 36),
	(8447, 'Príde policajt do Hiltonu a pýta sa:\r\n- Pán vrchný, aké tu máte najdrahšie jedlo?\r\n- Policajtský mozoček za 3500$.\r\n- A prečo je taký drahý?\r\n- Jáj, môj zlatý ty ani netušíš, aký problém je nájsť policajta s mozgom a ešte k tomu, na jednu porciu potrebujeme približne 20 policajtov...              ', 322, 4.1, 36),
	(8448, 'Do policajného zboru prijali nového policajta. Pred nástupom do služby si ho predvolal náčelník.\r\n- Hlavne si zapamätaj, že strieľať do ľudí je u nás zakázané!\r\n- A v ktorých mesiacoch?              ', 216, 2.42, 36),
	(8449, 'Príde policajtov syn domov a vraví otcovi:\r\n- Tatko, v škole mi vraveli, aby som šiel do osobitnej školy.\r\nPolicajt vypne hruď: \r\n- Nooo, synu, keď na to máš, tak študuj, študuj...              ', 205, 3.75, 36),
	(8450, 'Idú traja policajti za sebou a prvý kýchne. \r\nDruhý na to: \r\n- Na zdravie. \r\nTretí nevie o čo ide, ale ohradí sa: \r\n- A mne ste prečo nenaliali?!              ', 167, 3.25, 36),
	(8451, 'Policajný riaditeľ dostal na stôl hlásenie: Z továrne na parochne ukradli metrák vlasov. Policajti teraz prečesávajú celé okolie.              ', 153, 3.57, 36),
	(8452, 'Prečo nosia policajti čiapky?\r\nPretože každý hajzel musí mať poklop.              ', 89, 3.71, 36),
	(8453, '- Pán policajt, je táto ulica bezpečná?\r\n- Samozrejme, keby nebola, tak by som tu nebol.              ', 106, 3.33, 36),
	(8454, 'Prečo jazdí na motorke vždy iba jeden policajt?\r\nLebo keď sú dvaja, nevedia sa dohodnúť, kto bude sedieť pri okne.\n', 123, 3.4, 36),
	(8455, 'Ležia dvaja policajti na koľajniciach a smutne sa pozerajú, ako im práve vlak prešiel nohy. Jeden vyčíta druhému: \r\n- Debil, ja som ti vravel, že to nehúkala sova!!!\n', 176, 3.5, 36),
	(8456, 'Idú dvaja "príslušníci" v noci parkom, keď na jedného príde nutnosť. \r\n- Počuj, Tonko, počkaj na mňa chvíľku, ja si skočím iba tuto za krík. \r\nTonko poslušne prešľapuje na cestičke, a v tom sa ozve z krovia hlas: \r\n- Tonko, hoď mi sem baterku! \r\nTo ho trochu zarazí, odopne baterku, ale nedá mu to, aby sa nespýtal: \r\n- To tam hľadáš, to hovno?\r\n- Ale figu, to hovno som mal v ruke už 4x, ale hľadám obušok.              ', 452, 3.4, 36),
	(8457, 'Araňa išla na políciu podať oznámenie, že ju Dežo znásilnil a zbil. Policajt na to, že treba spraviť rekonštrukciu. Tak s Araňou došiel do parku, ona mu ukázala, kde sa to stalo. Policajt ju znásilnil a hovorí:\r\n- Araňa, klamala si, že ťa Dežo potom zbil. \r\n- Neklamala! Zbil ma tamto pod tým stromom, hneď ako som mu povedala, že mám syfilis.              ', 381, 4.06, 36),
	(8458, 'Sedia dvaja policajti na moste a špinia do vody. Strážmajster sa po chvíli s obdivom spýta: \r\n- Kapitán, ako to robíte, že vám to hovno zakaždým tak pekne pleskne?\r\n- No, ja si vždy najprv stiahnem nohavice.              ', 233, 3, 36),
	(8459, 'Policajt kontroluje doklady prostitútke a pýta sa:\r\n- Čím sa živíte, slečna?\r\n- Poskytujem erotické služby, viete?\r\n- Naozaj? A z toho sa dá žiť? To sa mi nejako nezdá. Viete, z vlastnej skúsenosti viem, že sa za to skôr platí!              ', 258, 3.4, 36),
	(8460, 'Idú dvaja policajti autom, keď v tom jeden z nich hovorí: \r\n- Zastav niekde pri kríkoch, akosi mi treba na veľkú.\r\nAuto zastaví, policajt vybehne do kríkov a po chvíli kričí na kolegu: \r\n- Hej, Ľudovít, nemáš pri sebe papier?\r\n- Načo, ty blbec? Nechaj ho tam!              ', 289, 3.75, 36),
	(8461, 'Prečo plače policajtov syn na lúke?\r\nVykopal si jamu a namôze si ju vziat domov.              ', 98, 3.3, 36),
	(8462, 'Policajt kupuje v obuve:\r\n- Prosím si šnúrky do topánok.\r\n- Aké si želáte?\r\n- Čo aké? Pedsa jednu ľavú a jednu pravú!              ', 143, 4.06, 36),
	(8463, 'Horí policajná stanica, všetci policajti vyjdú na strechu. prídu hasiči rozprestrú plachtu a vravia skáčte, ide prví policajt, a hasiči hmm ten mi minule dal pokutu, šup, plachtu dajú preč. Jeden mŕtvy, ide druhy aha tento mi minule dal papuču na auto, skočí, šup plachtu zasa dajú preč. Druhy mŕtvy. Ide generál, vytiahne pištoľ a vraví "ha ha ha vy ma neoserete! natiahnite plachtu a meter od nej!".              ', 441, 3.5, 36),
	(8464, 'Pán Novák príde na policajnú stanicu \r\na požiada, či by sa mohol stretnúť so zadržaným lupičom, ktorý v noci vnikol do ich bytu.\r\n"No dobre, ale nesmiete ho udrieť. Čaká ho súd."\r\n"Nebojte sa, ja mu nič neurobím, chcem sa ho len spýtať, ako sa mu podarilo k nám v noci\n', 290, 2.67, 36),
	(8465, '"Tak čo, Pate",  hovorí sympatický policajný inšpektor v Oklahome starému povaľačovi. "Čo vás sem priviedlo?"\r\n"Dvaja policajti, pán inšpektor."\r\n"Zase opitý, však?", pýta sa inšpektor.\r\n"Yes, obaja..."              ', 232, 3, 36),
	(8466, 'Americký policajt vypočúva zlodeja: \r\n"Prečo ste sa vlúpali do tej istej samoobsluhy dvakrát?"\r\n"Vyprovokovala ma tabuľka s nápisom: Vstúp. Neodídeš s prázdnymi rukami!"              ', 195, 3.33, 36),
	(8467, 'Príslušník polície zastaví vodiča začiatočníka:\r\n"Nevideli ste značku? Po tejto ceste sa jazdí len jedným smerom!"\r\n"No a čo?" ohradí sa vodič. "Ja hádam idem dvoma smermi?"              ', 203, 3, 36),
	(8468, 'Majiteľ obchodu s liehovinami v Paríži telefonuje v noci na políciu: \r\n"Rýchlo príďte, niekto mi vykradol obchod!" Komisár vyslal stíhaciu skupinu. Za pol hodiny vedúci skupiny podáva správu vysielačkou:\r\n"Už sme ich chytili. Boli to nejakí mládenci..."\r\n"Gratulujem", chváli ho komisár. "Ako to, že sa vám ich podarilo tak rýchlo chytiť?"\r\n"To viete, utekali po štyroch..."              ', 411, 3, 36),
	(8469, 'Sekretárka oznamuje americkému bankárovi:\r\n"Je tu nejaký pán a hovorí, že sa chcel dozvedieť niečo o tajomstvách vašich úspechov..."\r\n"A je to novinár, alebo niekto od polície?"              ', 205, 3, 36),
	(8470, 'Stojí policajt pred automatom na kávu. Vhodí mincu, automat zarachotí a dá mu kávu.\r\nSituácia sa opakuje a natešený policajt už má asi 15 káv, keď ho osloví pani stojaca za ním.\r\n"Prosím vás, mohli by ste ma pustiť, ja si iba zoberiem jednu kávu a potom môžete pokračovať"\r\nPolicajt sa na ňu udivene pozrie a povie:" Teraz???? Keď vyhrávam!!!!!...."              ', 389, 4.1, 36),
	(8471, 'Pred pomocnou školou stojí veľa policajných áut.\r\nČím to je??\r\nNo buď majú rodičovské,\r\nalebo stretávku.              ', 130, 4.09, 36),
	(8472, 'Dohodnú sa dvaja policajti, že si privyrobia tlačením peňazí. Aby to nebolo také nápadné začnú tlačiť šeststo koruny. Po vytlačení\r\nrozmýšľajú, kde ju ísť rozmeniť. Rozhodnú sa ísť za veliteľom. O desať minút vyjde jeden z dvojice a druhý sa ho pýta: \r\n"No čo, rozmenil ti?" \r\nDruhý pohotovo odpovie: \r\n"Áno! Na dve tristo koruny."              ', 379, 4.02, 36),
	(8473, 'Idú dvaja policajti na obchôdzku a jeden skríkne: "Aha 50-korunáčka na zemi!"\r\nDruhý nato: "Tá je falošná." \r\n"Ale, ako si nato prišiel?", spýta sa prvý a 50-korunáčku roztrhne. Druhý nato: "No ty si už videl 50-korunáčku s tromi nulami?"              ', 270, 3.81, 36),
	(8474, 'Príde policajt do obchodu \r\ns čiapkami. Vyskúša si všetky šiltovky a nakoniec sa opýta predavačky:\r\n"Do kelu, to také so šiltom dozadu ani nemáte?"              ', 172, 4.1, 36),
	(8475, 'Stretnú sa dvaja policajti a jeden cmúľa čokoládu. Druhý sa pýta:\r\n"Kde si zohnal tú čokoládu?"\r\n"Tam v tom obchode za rohom."\r\n"Je tam veľa ľudí?"\r\n"Ani nie, tak na pol zásobníka."              ', 210, 3.2, 36),
	(8476, 'Viete, prečo keď idú dvaja policajti po chodníku, ten služobne mladší ide popri stene? \nAby sa oťukal.              ', 124, 2.63, 36),
	(8477, 'Stretnú sa dvaja policajti a jeden hovorí druhému: \n"Bol som včera u doktora na zistenie otcovstva. Predstav si, bral mi krv, ale neviem prečo z prsta?!"              ', 172, 3.67, 36),
	(8478, 'Jeden policajt vraví druhému:\n,,Tak som sa pozeral do kalendára a vidím, že tento rok vychádza na piatok."\nDruhý na to : ,,Len aby to nebolo 13.!"              ', 167, 2.35, 36),
	(8479, 'Prečo nemáte stierače?\n- Prísne sa pýta miestny policajt.\n- Dal som ich dolu, aby ste mi za ne nemohli zasúvať pokuty!              ', 139, 3.89, 36),
	(8480, 'V Bratislave zastaví policajt auto a vyťahuje pokutový blok. Na to vodička hovorí:\n-Poraďte pán poručik, máte varovať vy mňa, že dostanem pokutu, alebo ja vás,že muž je minister?              ', 207, 2.8, 36),
	(8481, '-Prečo si policajti berú do auta pílu?\n-Aby mohli rezať zákruty.              ', 83, 4.17, 36),
	(8482, '"Mate psa, pán Slivka?!"\n"Nie."\n"Tak okamžite otvorte, polícia!"              ', 81, 3, 36),
	(8483, 'Príde si policajt kúpiť do drogérie kúpiť dezodorant. Predavačka sa pýta: "Chcete guľkový?"\nNie pod pazuchy.              ', 132, 4.12, 36),
	(8484, 'Všetci mestskí policajti dostali nové služobné digitálne hodinky. A raz sa jeden chodec pýta policajta:\r\n"Šéfe, koľko je hodín?"\r\n"Jedenásť deleno dvadsaťtri, ale nemám čas, tak si to vypočítaj sám." odvetí policajt.              ', 250, 2.86, 36),
	(8485, '"Pozri, kúpil som si nové poltopánky," hovorí policajt žene, "ale dnes si ich ešte nemôžem obuť, až o niekoľko dní."\r\n"A to už prečo?" čuduje sa manželka.\r\n"Predavač mi povedal, že prvé dni ma budú tlačiť."              ', 242, 4, 36),
	(8486, 'Dvaja policajti idú spoločne na obchôdzku a jeden sa pýta druhého:\r\n"Prečo so sebou stále nosíš ten skrutkovač?"\r\n"No, keby ma náhodou nejaký blbec vytočil a mne by povolili nervy."              ', 208, 3, 36),
	(8487, 'Dva policajti si vykračujú po ulici.\r\n”Aha,” ukazuje jeden na oblohu, ”helikoptér.”\r\n”To nie je helikoptér,” opravuje ho premiant zvláštnej policajnej školy, ”ale helikoptéra.”\r\n”Teda kamarát,” žasne prvý, ”ty máš ale dobré oči!”              ', 282, 3.33, 36),
	(8488, 'Hádali sa deti policajtov,kto z nich má najsprostejšieho otca:\r\n”Môj otec raz prešiel na červenú, potom zastavil a naparil si pokutu.”\r\n”Môj otec si raz sadol do auta, a keď zistil že je opitý, odviezol sa na záchytku.”\r\n”Môj otec raz išiel do TUZEXU, preskočil pult a požiadal o azyl.”              ', 328, 3.83, 36),
	(8489, 'Príde policajt do drogérie a pýta si jeden šampón.\r\n”Nech sa páči, ale máme iba vajíčkový.”\r\n”Ďakujem, ja som chcel na vlasy.”              ', 160, 3.75, 36),
	(8490, 'Je leto, policajti na ceste pristavia vodiča a vravia:\r\n”Človeče, vy ste pili?”\r\n”Nie. Prečo?”\r\n”Však idete teraz v lete s lyžami na streche!”\r\n”Však hej, ale to sú vodné lyže!”\r\nDruhý policajt hovorí:\r\n”To je dobre, nie je podozrivý. Pustíme ho.”\r\nO chvíľku policajt rozmýšľa a vraví druhému:\r\n”Počúvaj, predsa bol podozrivý!”\r\n”Prečo?”\r\n”Však u nás v dedine sú dve jazerá, ale ani jedno nie je dole kopcom!”              ', 484, 3.86, 36),
	(8491, 'Idú dvaja policajti po ZOO. Jeden z nich uvidí ťavu a vraví tomu druhému:\r\n”Pozri, ako zbili toho koňa.”              ', 128, 3.75, 36),
	(8492, 'Rozčúlený policajt vtrhne do Mototechny, nahnevane hodí na pult akýsi balíček a zreve na predavačku:\r\n”Počúvajte, minulý týždeň som si u vás kúpil odrazové sklíčka, no ako som zistil, predali ste mi akési nepodarky, nejaký šmejd!\r\n”Naozaj?” čuduje sa predavačka.\r\n”Naozaj, len raz som sa s nimi odrazil od steny garáže a už je po nich.”              ', 387, 3.6, 36),
	(8493, 'Mestský policajt kontroluje občana, pričom sa trocha chváli:\r\n”Mne stačí na človeka iba pozrieť a hneď viem, čo si myslí.”\r\n”A nie je to pre vás nepríjemné?”\n', 180, 4, 36),
	(8494, '”Tak čo, Fero?” prihovára sa policajný inšpektor starému známemu povaľačovi. ”Čo vás sem priviedlo?”\r\n”Dvaja policajti, pán inšpektor.”\r\n”Zase opitý, však?” pýta sa inšpektor.\r\n”Áno, obaja.”              ', 241, 4.1, 36),
	(8495, 'Policajt vypočúva zlodeja:\r\n”Prečo ste sa vlúpali do tej istej samoobsluhy dvakrát?”\r\n”Vyprovokovala ma tabuľka s nápisom: Vstúp. Neodídeš s prázdnymi rukami!”              ', 192, 2.33, 36),
	(8496, 'Taxikár je vypočúvaný na polícii:\r\n”Máme dokázané, že ste boli v bezprostrednej blízkosti v čase, keď niekoľko výtržníkov bilo policajta. Prečo ste sa nečinne prizerali?”\r\n”To je ťažké, ja nemám nič proti policajtom.”              ', 262, 3.17, 36),
	(8497, 'Policajt prišiel na prehliadku múzea a posadil sa na starožitnú stoličku. Prišiel strážnik a rozčúlene\r\nho napomenul:\r\n”Ako si môžete sadať na stoličku?\r\nNa nej sedel sám Shakespeare!”\r\n”Len sa nerozčuľujte, keď sa vráti, miesto mu uvoľním!”              ', 284, 4, 36),
	(8498, 'Dvaja mestskí policajti hliadkujú v parku. Zrazu vidia na lavičke sedieť muža, ktorý práve dojedol jablko. Ohryzok zabalil a schoval si ho do vrecka. Policajti sa začudovali, a tak sa ho pýtajú:\r\n”Prosím vás, prečo ste si dali ten ohryzok do vrecka?”\r\nMuž si z nich chce vystreliť, a tak vraví:\r\n”Viete, tie jadierka podporujú tvorbu a rast mozgových buniek.”\r\n”Jéj, to je niečo pre nás.” zaradujú sa policajti. ”A nepredali by ste nám ten ohryzok?”\r\nMuž súhlasil a vypýtal si zaň 50 korún. Policajti ohryzok kúpili, rýchlo vybrali jadierka, zjedli ich a išli ďalej. Po chvíli jeden vraví:\r\n”Ty, počúvaj, za 50 korún sme mohli mať aj kilo jabĺk.”\r\nTen druhý na to:\r\n”Vidíš?! Už to začína účinkovať!”\n', 772, 3.88, 36),
	(8499, 'Policajtov syn píše domácu úlohu. Na chvíľu sa zarazí a pýta sa otca:\r\n”Oci, aký je budúci čas od slovesa kradnúť?”\r\n”Sedieť.”              ', 162, 3.94, 36),
	(8500, 'Štyria policajti nasadnú do auta a idú na Krížnu skontrolovať prostitútky. Keď tam prídu, stiahnu okienko a jeden sa pýta:\r\n”Tak, za koľko to robíte?”\r\nJedna odpovedá:\r\n”Spredu za 300 a zozadu za 500.”\r\nPolicajt na zadnom sedadle tiež stiahne okienko a pýta sa:\r\n”A prečo to my vzadu máme drahšie?”              ', 342, 3.33, 36),
	(8501, 'Dvaja policajti hraju karty keď v tom niekto zaklope. Jeden hovorí:"Idem otvoriť" ,na to ten druhý "ja som si zaklopal, tak si aj otvorím"              ', 157, 4, 36),
	(8502, 'Dvaja policajti idú na obchôdzku po meste. Naraz začujú staršiu pani ako strašne kričí :\r\n"Pomóóóc, okradli ma!"\r\nVzápätí uvidia mladíka ako odtiaľ rýchlo uteká. Začnú ho prenasledovať, a asi po desiatich minutách ukrutného behu jeden policajt z posledného dychu povie druhému: \r\n"Kašlime naňho. Už si necítim nohy!"\r\nTen druhý nato :\r\n"Tak si pričuchni k mojim!"              ', 408, 3, 36),
	(8503, 'Nápis na nástenke na polícií: Policajt v službe nepije! \r\nKtosi tam dopísal: Bol taký, ale už nežije.              ', 124, 4, 36),
	(8504, 'Policajt chytí na pláži pytliaka a chce mu dať pokutu za lov homárov bez povolenia.\r\n”Akú pokutu?” začuduje sa pytliak. ”Veď som nič neurobil. Tieto dva homáre sú moji miláčikovia a ja som s nimi len na prechádzke.”\r\n”Nevymýšľajte si!” oborí sa na neho policajt.\r\n”Je to pravda!” trvá na svojom pytliak. ”Pustím ich, aby si zaplávali, a keď zapískam, tak sa vrátia.”\r\n”No to chcem teda vidieť.” povie pochybovačne policajt. Muž teda hodí obidva homáre do vody.\r\n”Fajn. Teraz zapískajte a som zvedavý, či sa tie homáre vrátia” povie po chvíli policajt.\r\n”Homáre?” začuduje sa pytliak. ”Aké homáre?”              ', 686, 3.71, 36),
	(8505, '”Pán policajt, prečo sa na nás tak pozeráte? To ste ešte nikdy nevideli pár milovať sa v aute?”\r\n”Videl, ale nie na najfrekventovanejšej križovatke...”              ', 182, 3.5, 36),
	(8506, 'Idú traja policajti a zrazu ponad nich preletia tri lietadlá. Veliteľ im hovorí:\r\n”Aha, chlapci, tryskáče.”\r\nO chvíľu letia späť už iba dve lietadlá a jeden z nich kričí:\r\n”Veliteľ, aha, dvaskáče...”              ', 238, 3, 36),
	(8507, 'Na policajnej akadémii prijímajú nových uchádzačov. Pýtajú sa jedného, koľko je štyri plus štyri.\r\n”Dvanásť.” odpovie uchádzač.\r\n”Výborne, ste prijatý. Povedali ste nám viac, ako sme od vás očakávali.”              ', 245, 4, 36),
	(8508, 'Na námestí zlodej vykráda obchod. Okolo idú dvaja policajti. Jeden drgne do druhého a šepká mu:\r\n”Pridajme do kroku, rýchlo... nech si nás nevšimne...”              ', 179, 2.75, 36),
	(8509, 'Hovorí v kine policajt policajtovi:\r\n”Teraz sa príprav, príde happy end!”\r\n”Jaj, len aby si nesadol pred nás!”              ', 136, 3.25, 36),
	(8510, 'Dvaja policajti sa rozprávajú a jeden sa pýta:\r\n”Ako je to podľa teba, že slnko zapadá každý večer?”\r\nDruhý odpovedá:\r\n”Podľa mňa nezapadá, iba ho nevidieť, lebo je tma.”              ', 207, 3.17, 36),
	(8511, 'Dopravní policajti zastavia vodiča a hovoria mu:\r\n”Vy ste pili!”\r\n”No a čo,” odpovedá vodič, ”Hemingway a Beethowen pili tiež.”\r\nPolicajt sa otočí k druhému:\r\n”Fero, dávaj bacha! Ešte tadiaľto pôjdu dvaja opití.”              ', 256, 3.67, 36),
	(8512, 'Policajná hliadka našla na chodníku ležať tuleňa. Tak ho zobrali so sebou na policajnú stanicu:\r\n”Pán náčelník, našli sme ho na ulici, čo s ním?”\r\n”Preboha, veď je to tuleň. Rýchlo ho vezmite do ZOO!”\r\nNa druhý deň ide náčelník domov a cestou stretne oboch policajtov, ako ťahajú za sebou tuleňa:\r\n”Idioti, vravel som vám, aby ste ho vzali do ZOO!”\r\n”Tam sme boli včera. Dnes ideme do kina!”\n', 435, 3.5, 36),
	(8513, 'Policajt príde domov, pozrie do chladničky a zmláti ženu. Takto to ide už tri dni. Žena to nevydrží a opýta sa, prečo ju po tri dni mláti ako pri policajnej akcii. Policajt na to:\r\n”Koľkokrát som ti povedal, aby si v chladničke zhasínala svetlo?”              ', 279, 3, 36),
	(8514, 'Príde náčelník a oznámi svojmu zboru:\r\n”Chlapci, zajtra ideme na Figarovu svadbu.”\r\nNa druhý deň prídu všetci v oblekoch a s kyticami. Náčelník im na to hovorí:\r\n”Preboha, načo ste si vy tupci doniesli kytice, nejdeme na ozajstnú svadbu, to je len opera.”\r\nVtom sa ozve nesmelý hlas:\r\n”Ale, ale a ktože to minule prišiel na Labutie jazero s udicou?”              ', 393, 4, 36),
	(8515, 'Policajt vstúpi do knižnice. Knihovníčka sa ho pýta: \r\n”Ale čo, vonku prší?”              ', 102, 4, 36),
	(8516, 'Ide policajt v noci po parku a z kríka počuje vzdychy.\r\n”Čo tam robíte?”\r\n”Milujem sa.” ozve sa z kríka mužský hlas.\r\n”100 korún pokuty.” hovorí policajt.\r\n”Za čo?” zaznie ženský hlas.\r\n”Aha, tak vy ste dvaja, tak to bude za 200.”              ', 276, 4.17, 36),
	(8517, 'Fero stretne Miša a už mu zvestuje:\r\n”Počul si o havárii, ktorá sa stala pri komíne mestskej teplárne?”\r\n”A čo sa stalo?”\r\n”Hneď vedľa komína spadol policajný vrtuľník.”\r\n”A ako sa to stalo?”\r\n”V noci čakal, až mu naskočí zelená a zatiaľ mu došlo palivo.”              ', 310, 3.6, 36),
	(8518, 'Idú po ulici dve ceruzky. Ktorá z nich je policajná?\r\nTa tupá.              ', 80, 3.64, 36),
	(8519, 'Príde policajt do práce a hovorí:\r\n”Chlapi, ja som geniálny!”\r\n”Prosím ťa a ako si na to prišiel?”\r\n”No predstavte si kúpil som si puzzle a tam bolo napísané 3 - 5 rokov. A ja som to zložil už za rok.”              ', 239, 4.02, 36),
	(8520, 'Jeden policajt sa pýta druhého:\r\n”Ako skončil včerajší zápas?”\r\n”0:0”\r\n”A prvý polčas?”\r\n”Neviem, ten som nepozeral.”              ', 156, 3.67, 36),
	(8521, 'Policajt zastaví auto:\r\n”Prekročili ste stovku pani!”\r\n”To iba v tomto klobúku tak staro vyzerám!”              ', 124, 3.88, 36),
	(8522, 'Dvaja policajti lezú po stĺpe VN a okolo ide babka. Pýta sa ich čo robia, prečo neodmerajú ten čo leží kúsok odtiaĺ. \r\nOni na to:"Babka mi meriame výšku, nie dĺžku".               ', 195, 2.47, 36),
	(8523, 'Policajt zastaví blondínku a hovorí:"Dajte mi vodičský preukaz".\r\nBlondínka mu podá zrkadielko a policajt hovorí:"prepáčte nevedel som, že ste príslušníkom polície".              ', 194, 3.25, 36),
	(8524, 'Na policajnej stanici robili nábor nových vyšetrovateľov. Jednému z adeptov dáva kapitán otázky:\r\n”Koľko je jedna plus jedna?”\r\n”Jedenásť.”\r\n”Ktoré dva dni v týždni začínaju na ´P´?”\r\n”Pozajtra a predvčerom.”\r\n”A posledná otázka - kto zabil Abrahama Lincolna?”\r\nChlapík sa zamyslí a potom hovorí:\r\n”Tak to vážne neviem.”\r\n”Tak bežte domov a skúste na tom popracovať.”\r\nChlapík príde domov a vraví manželke:\r\n”Predstav si, prvý deň a už mi hneď dali vraždu!”              ', 541, 3.6, 36),
	(8525, 'Policajt v noci zastaví dvoch chlapíkov a pýta si od nich doklady. Policajt vezme prvý občiansky preukaz a číta:\r\n”Občiansky preukaz.”\r\nPotom vezme druhý a opäť číta:\r\n”Občiansky preukaz. Vy ste bratia?”              ', 239, 3.79, 36),
	(8526, 'Stretnú sa dvaja policajti.\r\n”Práve som odviezol manželku do pôrodnice.” vraví jeden.\r\nDruhý na to:\r\n”Hej, a čo jej je?”              ', 149, 3.29, 36),
	(8527, 'Viete prečo policajti nosia čiapku?\r\nKaždý hajzel má dekel.              ', 78, 3.4, 36),
	(8528, '”Chlapček, ako sa voláš?”\r\n”Petrík.”\r\n”A čím chceš byť?”\r\n”Neviem.”\r\n”Chlapček, ako sa voláš ty?”\r\n”Neviem.”\r\n”A čím chceš byť?”\r\n”Policajtom.”              ', 204, 4.07, 36),
	(8529, 'Dvaja policajti sedia pri poháriku\r\na jeden vraví:\r\n”Dopočul som sa, že si dnes pochoval manželku.”\r\n”Áno, musel som... ona totiž zomrela.”              ', 168, 3.2, 36),
	(8530, 'Policajt čaká na manželku na stanici. Staničný rozhlas hlási:\r\n”Rýchlik z Prahy má hodinu meškanie.”\r\n”To je celá ona.” povzdychne si policajt. ”Nikdy nemôže prísť načas.”              ', 212, 3.33, 36),
	(8531, 'Policajt bol za zásluhy vyslaný do Afriky. Keď sa po čase vrátil, tak sa ho kolegovia vypytovali, či tam mal zbraň a či si zastrieľal. \r\n- To viete, - chváli sa kolegom, - zastrelil som jedného slona, dve antilopy a štyridsať nouplísákov.\r\nKolegovia sa čudovali, a tak im ďalej rozprával:\r\n- Behali tam takí zvláštni tvorovia, a keď som na nich zamieril, tak zdvíhali ruky a volali „Nou plííís".              ', 437, 3, 36),
	(8532, '- Ktorý policajt najďalej doští?\r\n- Ten, čo si rozopne gate a dá dolu trenky!              ', 97, 3.82, 36),
	(8533, 'Ide policajt na motorke a hovorí:\r\n"Ja sa poserem......"\r\nZa chvíľu opäť:\r\n"Ja sa poserem......"\r\n"UGH!!!!!!"\r\n"Doprdele, však som to hovoril!"\n', 150, 2.5, 36),
	(8534, '- Moja manželka má rozumu za dvoch, - chváli sa policajt kolegovi v službe.\r\n- No vidíš, ja som ti hovoril, že ona je pre teba tá pravá.              ', 159, 3, 36),
	(8535, '- Viete, čo urobí policajt, keď dostane chuť na lekvár?\r\n- Ošúpe si buchtu.              ', 96, 3.71, 36),
	(8536, '- Prečo, keď idú dvaja policajti po chodníku, ten služobne mladší, ide popri stene?\r\n- Aby sa oťukal.              ', 123, 2.67, 36),
	(8537, 'Sedí policajt nad jedálnym lístkom. \r\n- Čo si dáte? pýta sa netrpezlivo čašník. \r\n- Tu toto - pommes frites, ukazuje strážnik na jedlo s najnižšou cenou. \r\n- A čo k tomu? \r\n- Hranolky...              ', 214, 3.21, 36),
	(8538, 'Policajt ide tapetovať byt. Spomenie si, že sused, tiež policajt, tapetoval nedávno. Zabehne k nemu a pýta sa ho: \r\n- Koľko kotúčov tapiet si kupoval? \r\n- Desať. Po týždni za ním príde opäť: \r\n- Počúvaj, ty si mi teda pomohol! Veď mi stačili len štyri balíky! \r\n- Veď aj mne.              ', 311, 4.11, 36),
	(8539, 'Začala horieť policajná stanica. Policajti boli nútení ísť až na strechu. Keď prišli hasiči, natiahli plachtu a policajti začali po jednom skákať. Ale vždy, keď bol už policajt tesne nad zemou, tak plachtu odtiahli a hrozne sa na tom zabávali. Až prišiel na rad posledný - náčelník. Ten, vidiac podraz, vytiahol revolver namieril na hasičov a rázne zahlásil: - So mnou nevybabrete, plachtu na zem a všetci tri kroky dozadu!              ', 465, 3.67, 36),
	(8540, 'Chlapček sa pýta muža v uniforme: - Ujko, vy ste policajt? - Nie, chlapček, ja som železničiar, to som sa len tak blbo zatváril...              ', 151, 3, 36),
	(8541, 'Malý chlapček príde za policajtom a pýta sa ho: \r\n- Pán policajt, nie je to váš obušok? \r\nPolicajt: \r\n- Nie, chlapče, ďakujem, ja som ten svoj stratil.              ', 175, 3.75, 36),
	(8542, 'Prečo si policajt neumýva zuby?\r\nLebo sa mu nezmestí mydlo do úst.              ', 84, 3.25, 36),
	(8543, 'Policajt zastaví auto a vyčíta šoférovi prísnym hlasom:\r\n- Už vám po tretíkrát hovorím, že vám tečie z chladiča voda!\r\nVodič rozčúlene odpovedá:\r\n- A ja vám po tretíkrát hovorím, že toto je polievacie auto!              ', 244, 3.67, 36),
	(8544, 'Policajt sa rozhodne, že si uloví vianočného kapra. Zobral náradie a začal sekať dieru do ľadu. Odrazu príde za ním jeden pán a kričí:\r\n- Okamžite prestaňte sekať do toho ľadu!\r\n- Akým právom mi to zakazujete!?\r\n- Právom správcu zimného štadiónu!               ', 285, 3, 36),
	(8545, 'Stretnú sa dvaja policajti v januári na ulici. „Je mi zima na ruky." „Tak si ich daj do vrecka." „Nemôžem, mám tam rukavice."              ', 150, 3.91, 36),
	(8546, 'Viete, prečo majú policajti otvorené dvere pri štartovaní auta?\r\nAby naskočil motor.              ', 104, 4.15, 36),
	(8547, 'Príde policajt do obchodu: \r\n"Prosil by som si papier na riť," žiada. \r\n"Nevraví sa na riť," opravuje ho jemnocitná predavačka, "vraví sa toaletný! Želáte si ešte niečo?" \r\n"Mydlo," povie policajt. \r\n"Toaletné?" \r\n"Nie," vrtí hlavou policajt, "na ruky!"              ', 282, 3.75, 36),
	(8548, 'Dvaja policajti stoja pri trati, po ktorej práve prechádza vlak. Ten jeden hovorí: \r\n"Tá lokomotíva, tá si to ale serie, že?" \r\nA druhý pritakáva: \r\n"No hej, ale ani tie vagóny nejdu zle..."\n', 201, 3, 36),
	(8549, 'Dvaja policajti stoja pri rieke. Podíde k ním staršia pani a spýta sa, kde by sa dala tá rieka prebrodiť. Policajti rýchlo odpovedia: \r\n"No, hneď aj tu pred nami." Pani poďakuje a odvážne vstúpi do rieky. Čľup, voda sa za ňou zavrie a pani sa utopí. Policajti sa zamyslia, krútia hlavami, až sa jeden z nich ozve: \r\n"Človeče, veril by si tomu? Pred chvíľou tadeto v pohode prešla kačica."\n', 413, 3.4, 36),
	(8550, 'Viete, prečo má policajt pri posteli jeden pohár plný a jeden prázdny?\r\nLebo v noci môže mať smäd, ale aj nemusí.              ', 137, 3.79, 36),
	(8551, 'Policajt ide po ulici a zrazu zbadá na jednom balkóne v klietke papagája. Ako tak zíza, papagáj vyhrkne: \r\n"Ty krrrretééén!" \r\nPolicajt urazený odíde. Na druhý deň vykonáva svoju obchôdzku, zbadá papagája a ten opäť vyhŕkne: \r\n"Ty krrrretééén!" \r\nPolicajt sa naštve a dá majiteľovi ultimátum: \r\n"Buď sa to už nebude opakovať, alebo dáte papagája utratiť."\r\nTretí deň ide okolo a nič sa nedeje. Zájde za roh a zase sa vráti a pozerá na papagája. Ten mu hovorí: \r\n"Však ty viéééš!"              ', 538, 3.56, 36),
	(8552, 'Vieš o čom sa hádajú štyria policajti v aute?\r\nKto bude sedieť pri okne.              ', 92, 4.25, 36),
	(8553, 'Na policajnú stanicu príde jeden poliš s termoskou . Kolega sa ho pýta čo je to a načo to slúži: \r\n"To je termoska a keď dáš do vnútra niečo horúce tak to aj ostane horúce, no keď tam dáš niečo studené tak to aj ostane studené." \r\n"A čo tam máš?" \r\n"2 kávy a 4 nanuky."\n', 295, 3.43, 36),
	(8554, 'Dvaja policajti sa vezú v aute. Na križovatke naskočí červená, oni zastavia a čakajú. Naskočí oranžová, stoja, naskočí zelená, stoja. Opäť naskočí červená a jeden policajt hovorí druhému: - Fero, môžeme ísť, túto sme už videli!              ', 270, 3, 36),
	(8555, 'Bavia sa dvaja mladíci: \r\n- A vieš, aký je rozdiel medzi policajtom a blbcom?\r\n- Neviem.\r\nNaraz sa spoza rohu vynorí policajt: \r\n- No, aký, aký?!\r\n - Žiadny.\r\n- Veď preto!              ', 193, 4.08, 36),
	(8556, 'Policajt sa pýta svojho kolegu: \r\n- Bol si na Štrbskom plese?\r\n- Nie, moja žena nerada tancuje.              ', 112, 3.33, 36),
	(8557, 'Buzeruje policajný šéf svojich podriadených:\r\n-Ako to že ste nechali ujsť lupičov z tej banky !? Veď som vám kázal strážiť všetky východy ....\r\n-Ale keď oni ušli vchodom .....              ', 206, 3.98, 36),
	(8558, 'Dvaja policajti idú parkom a jeden z nich vraví:\r\n- Ešte 10 minút a končí nám šichta.\r\n- To je pohoda.\r\nOdrazu jeden z nich vykríkne:\r\n- Ty brďo, pozri, tam je mŕtvola. A práve teraz na konci služby. To je v riti. Vieš si predstaviť to papierovanie? To je na hodinu práce. \r\n- Vieš čo, mám nápad. Tu je aj tak koniec okrsku, tak tú mŕtvolu odnesieme do toho susedného. \r\nAsi o pol hodiny idú v tom susednom okrsku dvaja policajti a jeden z nich vraví:\r\n- Pozri, ona sa vrátila.              ', 517, 4.21, 36),
	(8559, 'Pýta sa čašník policajta:\r\n- Prečo plačete, pane?\r\n- Prišlo mi ľúto, hovorí policajt, - že kvôli takej malej porcii zabili celého vola!              ', 162, 3.5, 36),
	(8560, 'Policajt na skúške z matematiky:\r\n- Koľko je 3 x 3?\r\nPolicajt rozmýšľa a povie: 12.\r\nŠéf komisie hovorí:\r\n- Berieme vás! Povedali ste nám oveľa viac, ako sme od vás očakávali.              ', 204, 4, 36),
	(8561, 'Havária lietadla. Pošlú to vyšetriť dvoch policajtov. Prídu na miesto, obzerajú si trosky. Prvý sa ozve:\r\n"No páni, myslím, že mu odpadla vrtuľa." \r\nDruhý na to:\r\n"Ale netrep, však toto je prúdové lietadlo."\r\nA ten prvý to uzavrie:\r\n"Potom je to jasné, vypli mu prúd."              ', 301, 3.67, 36),
	(8562, 'Policajti pozorujú lietadlo. Jeden sa spýta: \r\n„Čo myslíte, je to súkromné alebo vládne lietadlo?"\r\n„Ty si ale hlupák," odpovie mu veliteľ. „Veď keby bolo vládne, tak ho po stranách sprevádzajú motorky!"\n', 224, 4, 36),
	(8563, 'Príslušník zastaví vodiča a vraví:\r\n"Prekročili ste povolenú rýchlosť v meste, išli ste 90 km za hodinu!"\r\n"To nie je možné, veď sedím v aute sotva 10 minút."\r\n"Och, pardon, tak potom šťastnú cestu."              ', 232, 4.18, 36),
	(8564, 'Policajti sledujú Preteky mieru. \r\n„To zase bude pokút! Toľko bicyklov a ani jeden nemá osvetlenie."              ', 120, 3.25, 36),
	(8565, 'Policajt pri kontrole automobilu: \r\n"Pán vodič, čo to máte v tom kufri ?"\r\n"Polovicu prasaťa." \r\n"A živého alebo mŕtveho ?"              ', 145, 3.5, 36),
	(8566, 'Policajt kupuje od iného policajta záhradu.\r\nAko si ju tak prehliada, škrabe sa za uchom a hovorí:\r\n"Veľmi pekná záhrada, ale je veľmi veľká."\r\n"Ale neblbni, sem dáš cibuľu, tu mrkvu a tu sliepky."\r\n"No dobre, dohodnuté."\r\nPo nejakej dobe sa opäť stretnú a ten predávajúci sa pýta:\r\n"Tak čo, záhrada?"\r\n"No perfektné. Cibuľa obrovská, mrkva až po pás, iba tie slepky. Či som ich nedal veľmi hlboko."              ', 442, 4.16, 36),
	(8567, 'Na jednej dedine služia dvaja policajti - Jožko a Ferko.\r\nNakoľko služia prevažne v noci, tak vyfasoval Jožko baterku a Ferko na oplátku obušok.\r\nRaz v noci sú na pochôdzke a na Ferka prišlo nutkanie na veľkú...\r\nZalezie si teda do krovia. Po chvíli sa z krovia ozve úpenlivý hlas:\r\n"Jožko, požičaj mi, prosím ťa, tú baterku!"\r\nJožko sa mu vysmieva:\r\n"To si chceš posvietiť na to hovno?"\r\n"Ale, kdeže hovno, to  som mal trikrát v ruke, ale obušok nemôžem nájsť..."              ', 510, 4, 36),
	(8568, 'Zlodej prepadne banku. V ruke drží odistený granát. Na to sa objaví policajt, vytiahne pištoľ a zakričí: \r\n”Oďhodte zbraň.”              ', 152, 3.89, 36),
	(8569, 'Dvaja policajti nájdu na ulici tri granáty. Nesú ich na policajnú stanicu a jeden sa pýta druhého: \r\n”Počuj, Jožo, a čo keď jeden vybuchne?” \r\nDruhý odpovie: \r\n”No a čo, povieme, že sme našli len dva.”              ', 237, 3.92, 36),
	(8570, 'Policajná hliadka zastaví nákladiak: \r\n”Pán vodič, už siedmy raz vás zastavujeme a naposledy vás upozorňujeme, že vám padá náklad!” \r\n”A ja vás už siedmy raz upozorňujem, že som posýpač!”              ', 228, 4.21, 36),
	(8571, 'Príde policajt do obchodu a vraví: \r\n“Prosím si poltopánky, hnedé, kožené.”\r\n“A aké máte číslo?”\r\n“158!”              ', 141, 4.14, 36),
	(8572, 'Vojde muž v modrom do krčmy. Hostinský sa pýta:\r\n- Čo si prajete modrý pane?\r\n- Ja som modrá tlama a chcem pivo. - hostinský mu dá pivo. \r\nO chvíľu vojde muž v červenom. Hostinský sa pýta:\r\n- Čo si prajete červený pane?\r\n- Ja som červená tlama a chcem pivo. - hostinský mu dá pivo.\r\nO chvíľu príde muž v zelenom. Hostinský sa pýta:\r\n- Čo si praješ zelená tlama?\r\n- Váš občiansky preukaz.              ', 435, 3.96, 36),
	(8573, 'Malý chlapec príde za policajtom a pýta sa ho:\r\n- Pán policajt, nie je to váš obušok?\r\n- Nie chlapče, ja som svoj stratil.              ', 144, 3.75, 36),
	(8574, 'Dvaja policajti sa člnkujú po jazere. Zrazu zafúka vietor, čln sa prevrhne a policajti sa utopia. Otázka znie: Koľko policajtov sa utopilo? \r\n- Celkovo štyria. Dvaja pri nehode a dvaja pri rekonštrukcii.              ', 225, 3.8, 36),
	(8575, 'Ide dedko po meste s vozom, ktorý ťahá kôň  a zastaví ho policajt, ktorý sa ho pýta:\r\n"Dedko, čo to veziete?" \r\nDedko odpovedá:\r\n"Banánovú šťavu." \r\nPolicajt mu hovorí:\r\n"Dajte mi ochutnať!" \r\nDedko mu dá ochutnať a policajt po prvom glgu šťavu vypľuje na chodník a hovorí mu:\r\n"Choďte s tým preč!!!" \r\nDedko sa posadí, vezme do rúk opraty a kričí:\r\n"Hióóó Banán!!!!!"              ', 416, 3.33, 36),
	(8576, 'Idú policajti lesom a vidia na strome obesenca:\r\n"Sakra, to bude zas papierovania. Keby visel o šesť stromov vedľa,  už  by to nespadalo do nášho rajónu...."\r\nOdrežú ho a priviažu o pár metrov vedľa.\r\nIdú policajti z vedľajšieho rajónu a zrazu vidia na strome obesenca.\r\n"Človeče hen na to! ON UŽ JE TU ZAS!"\n', 329, 4, 36),
	(8577, 'Stretnú sa dvaja policajti a jeden hovorí druhému:\r\n"Vieš o tom, že tento rok bude Silvester v piatok?"\r\nDruhý odpovedá:\r\n"Sakra, dúfam, že to nebude trinásteho!"\n', 173, 3.93, 36),
	(8578, 'Idú dvaja policajti a nájdu kostru.\r\n"Čo budeme robiť?" \r\n"Donesieme ju  patológovi a prezlečieme sa aby nespoznal, že sme policajti!" \r\n Patológ im hovorí:\r\n"Vy ste policajti, že?"\r\n"Ako ste na to prišiel?" divia sa obaja policajti.\r\n"No, páni, toto je kostra od bicykla!"\n', 286, 3.93, 36),
	(8579, 'Idú dvaja policajti na obchôdzke, keď tu jeden hovorí:\r\n"Aha, mŕtvy vták!"\r\nDruhý policajt si zacloní rukou oči, pozrie hore a hovorí:\r\n"Kde?"\n', 153, 3.67, 36),
	(8580, 'Príde policajt do obchodu a chce reklamovať televíziu, pretože nejde zvuk:\r\n"Sedím si večer pri televízii, špáram sa klincom v uchu a zrazu prásk a nejde zvuk."\n', 171, 3.8, 36),
	(8581, 'Na stanici Verejnej Bezpečnosti dostali nový písací stroj. Preto si urobili oslavu a pán kapitán slávnostne prestrihol pásku.\n', 134, 3.8, 36),
	(8582, 'Policajti majú výplatu, nadporučík ich volá podľa mena:\r\nŠéf: Novák 4800 ... (a Novák ide pre peniaze)\r\nŠéf : Mrkvička 5200  ... (a Mrkvička ide pre peniaze)\r\nŠéf: Súhrn ... (...nikto sa neozýva...)\r\nŠéf: Súhrn!! ... (...zase ticho...)\r\nŠéf: To je blbec, má tu 183 400 korún, a nechce si to vziať...              ', 339, 4.18, 36),
	(8583, 'Príde policajt do práce a chváli sa:\r\n"Chlapi, včera som si kúpil lampu, zapnem ju do siete a svieti. Ale potom som zavadil o nejakú šňúru a svetlo bolo preč. \r\nTak som ho išiel hľadať. Nemohol som ho nikde nájsť. Tak dlho som hľadal, až mi vyhladlo. Idem do chladničky, otvorím ju, a čo nevidím. Tá potvora bola tam."\n', 341, 3.29, 36),
	(8584, 'Železničiar: Čo mi tu beháte po trati?\r\nPolicajti: My nie sme žiadny potrati my sme policajti. \n', 101, 4, 36),
	(8585, 'Dvaja policajti našli pred kinom mŕtvolu. Začali spisovať protokol, ale nedokázali sa dohodnúť, aké \'i\' sa píše v slove kino. Tak jeden z nich hovorí:\r\n"Vieš čo? Odtiahneme tú mŕtvolu pred cukráreň."\n', 217, 3.83, 36),
	(8586, '"Kde bývate?" pýta sa policajt.\r\n"Nikde," odpovie tulák.\r\n"A vy?" obráti sa policajt na druhého.\r\n"Tiež nikde, my sme susedia."\n', 134, 2.86, 36),
	(8587, 'Prišli dvaja policajti do kaviarne, sadli a keď išiel okolo vrchný, jeden z nich hovorí:\r\n"Pán vrchný, dve kávy, prosím."\r\nA druhý policajt:\r\n"Tak mne tiež dve."\n', 173, 3.43, 36),
	(8588, 'Polnoc, cez park ide chlapík a spieva si. Príde k nemu policajt, pozrie naň a diví sa:\r\n"Človeče, vy máte kudlu v chrbte a spievate si, ako by sa nechumelilo!"\r\n"Pochopiteľne, keby som volal o pomoc, tak by ste neprišiel."\n', 232, 3.86, 36),
	(8589, 'Ide chlap autom a prehliadne nejakú značku obmedzujúcu rýchlosť. O chvíľu ho stopne policajt a pýta sa ho, či vie čítať. Chlap na to:\r\n"Áno, čo potrebujete?"\n', 172, 3.91, 36),
	(8590, 'Traja policajti stroskotajú a doplávu na ostrov. Žijú si tam spokojne až do dňa, keď ulovia zlatú rybku.\r\n"Keď ma pustíte, splním vám každému jedno želanie!"\r\nPrvý hovorí:\r\n"Nech som hneď doma!"\r\nA zmizol. Druhý:\r\n"Nech som hneď doma!"\r\nZostal veliteľ:\r\n"Ja sa tu sám bojím! Nech sú hneď naspäť!"\n', 324, 3.2, 36),
	(8591, 'Naskočí policajt do električky a zakričí:\r\n"Sledujte ten taxík!!!"\n', 73, 4.17, 36),
	(8592, 'Policajt prichádza k zlodejom, čo sa práve vlúpali do garáže:\r\n"Menom zákona, vzdajte sa!"\r\nSklamaný odchádza preč:\r\n"Hmm... Nevzdali sa..."\n', 151, 3.25, 36),
	(8593, 'Dvaja policajti:\r\n"Doktor mi povedal, že mám nosiť okuliare. Ale nepovedal mi, či ich mám nosiť v ľavej alebo pravej ruke."\n', 131, 2.71, 36),
	(8594, 'Dvaja policajti nemali kde bývať, a tak si kúpili vyradené spacie vagóny. Za pár dní sa stretnú:\r\n"Ja to mám dobré," hovorí prvý. \r\n"Mám tam, ale nápis \'Nefajčiari\' tak musím chodiť fajčiť von."\r\n"Ty sa máš, ja mám na záchode \'Používať len za jazdy\', a než vagón roztlačím, tak sa poseriem."\n', 322, 3.8, 36),
	(8595, 'Ide chlapík po námestí a vidí policajta, ako kope dieru. Nelení a spýta sa ho:\r\n"Čo tu kopete?"\r\n"Ale, máme sa vyfotiť na preukaz a má tam byť len hlava."\r\nZhruba za hodinu ide chlapík späť a policajt kope druhú dieru, tak sa ide zase spýtať:\r\n"Na čo tá druhá diera?"\r\n"Ale, máme mať tie fotky dve."\n', 322, 3.67, 36),
	(8596, 'Policajti sú u doktora. Doktor vyjde z dverí a hovorí:\r\n"Je vás tu veľmi veľa. Musíte chodiť po štyroch."\r\nTak náčelník prikývne a hovorí:\r\n"Tak ja idem prvý."\n', 175, 2.57, 36),
	(8597, 'Zastaví hliadka auto a vidí, že za volantom sedí pes.\r\n"Ako môžete nechať psa riadiť auto?" pýta sa policajt spolujazdca.\r\n"Mňa sa nepýtajte, ja som stopár."\n', 170, 3.75, 36);
INSERT INTO `mig_jokes` (`id`, `joke`, `joke_length`, `rank`, `category_id`) VALUES
	(8598, 'Ide policajt autobusom a vedľa neho sedí krásna žena. Policajt chce nejako nadviazať rozhovor, tak sa osmelí a pýta sa:\r\n"Slečna, tiež idete týmto autobusom?"\n', 169, 3.4, 36),
	(8599, 'Policajt sedí doma a zrazu niekto klope na dvere.\r\n"Kto je tam?" pýta sa policajt.\r\n"Ja," ozve sa spoza dverí.\r\n"Ja???"\n', 123, 4.08, 36),
	(8600, 'Vybehne policajt z pôrodnice a kričí: \r\nJa mám syna ! A dokonca je to chlapec!              ', 96, 4.03, 36),
	(8601, 'Dvaja policajti na obchôdzke. Jeden hovorí druhému: \r\n"Počuj starec, už si vôbec necítim nohy!"\r\n"Tak si čuchni k mojim."              ', 143, 4, 36),
	(8602, 'Prečo vykopal policajt dve jamy? \r\nLebo prvá bola malá.              ', 72, 3.67, 36),
	(8603, 'Viete prečo policajt stále otvára a zatvára flašu od coca-coly?\r\nLebo na vrchnáku je napísané: SKÚS ŠŤASTIE ZNOVA!              ', 139, 3.33, 36),
	(8604, 'Policajti dostanú vysielačky. Idú po meste, vtom v jednej zachrapčí a ozve sa hlas. Policajt sa pýta druhého:\r\n- Čo mám robiť?\r\n- No, predsa stlač gombík a povedz príjem, ako vo filme.\r\nPolicajt stlačí gombík a vraví:\r\n- 4 200 hrubý.\n', 252, 4, 36),
	(8605, 'Dvaja policajti sa rozhodli, že sa zahrajú na obchod. Policajt - kupujúci príde a vraví:\r\n- Liter chleba.\r\nPolicajt - predavač mu hovorí:\r\n- Nie liter, ale kilo.\r\n- Dobre, tak kilo chleba.\r\n- A džbán máte?\n', 216, 3.67, 36),
	(8606, 'Zastaví policajt homosexuála v aute:\r\n- Prosím váš vodičský preukaz!\r\n- To je tá rúžovučká knižôčka? Ty moja žabka zelená...              ', 155, 4.09, 36),
	(8607, 'Idú traja policajti.\r\nJednému sa kýchne.\r\nDruhý mu povie na zdravie.\r\nTretí hovorí : Nalejte aj mne!\n', 107, 3.86, 36),
	(8608, 'Ide policajt po ulici a hovorí si: “Myslím, teda som.” A zmizol...              ', 86, 4.03, 36),
	(8609, 'Do vesmíru letia dvaja - policajt a prasa. Každý dostane jednu obálku. Prasa ju má otvoriť pol hodinu po štarte a policajt hodinu po štarte. Po polhodine prasa otvorí obálku a číta: “Stlač červené tlačítko na prednom ovládacom paneli, potom nastav ovládač B38 na hodnotu 3,457. Nakoniec stlač zelené tlačítko na ovládači motora.” Prasa všetko urobí. Policajt je celý nervózny, aj on otvorí obálku a číta: “Nakŕm prasa, sadni si a ničoho sa nedotýkaj.”              ', 510, 4, 36),
	(8610, 'Policajt zastavil jedného vodiča a pýta si vodičský preukaz. Muž mu ho podá. Policajt sa naň pozerá a potom sa pýta:\r\n- Ako sa voláte?\r\nMuž odpovie a dodá: \r\n- A ten, čo vedel čítať, ten tu už nerobí?              ', 233, 3.64, 36),
	(8611, 'Prechádza sa policajt po chodbe v blázinci a vidi chlapca, ktorý skáče po kondóme a pýta sa : Chlapče prečo skáčeš po kondóme??? a chlapec na to : Čo nevidíš, skáčem gumu!!!\n', 192, 3.85, 36),
	(8612, 'Policajt volá náčelníkovi: "Pán náčelník, našiel som mŕtvolu neznámeho muža. Nemá ruky, ani nohy a ani hlavu. Na mŕtvole som nezistil stopy násilia..."              ', 180, 3.9, 36),
	(8613, 'Na strome sedí mŕtvica. Ide okolo jeden robotník, mŕtvica skočí, zatrasie a robotník ostane postihnutý. Ide okolo policajt, mŕtvica skočí, zatrasie... a nič. Znovu zatrasie... a zase nič. Zamyslí sa a povie si: "Jáááj, veď ja som mozgová!"\n', 259, 3.75, 36),
	(8614, 'Dvaja policajti idú po lese, jedného uštipne had.\r\nDruhý hovorí: neboj sa vyliečim ťa, čítal som o tom. Najprv sa musíš vysrať.Prečo, veď ma ušipol had (???)\r\nVyser sa a neodvrávaj. (poslúchol a vysral sa)\r\nTeraz to musíš zjesť.\r\n- Ani bohovi!\r\n- Zožer to!(poslúchol a  zožral to)\r\nZdravý policajt vyberie pištol a vystrelí do vzduchu. Potom hovorí: už by si mal byť zdravý, v knihe písali, že treba užiť sérum a vypáliť ranu.              ', 477, 4.28, 36),
	(8615, 'Z policajnej zápisnice: \r\nPri konfrontácii mŕtvola nespoznala svojho páchateľa!               ', 99, 3.8, 36),
	(8616, 'Syn policajta je na vojne. Z domu mu prišiel balík, ktorý zúfalo prehľadáva a vraví:\r\n”To je divné, mama píše, že moja žena je v tom a už som celý balík prehrabal dvakrát a nemôžem ju nájsť!”              ', 229, 4.11, 36),
	(8617, 'Ide policajt s manželkou do divadla, po polhodine sa vrátia a svokra sa ich pýta:\r\n”A čože tak skoro?”\r\n”Ale, v programe bolo napísané, že druhé dejstvo sa odohráva o dva roky.”\n', 196, 3.89, 36),
	(8618, 'Na policajnej stanici počas záverečných skúšok. Skúšajúci sa pýta:\r\n”Predstavte si, že idete cez park, zrazu k vám pribehne nádherná mladá žena a kričí, že ju práve znásilnili. Čo urobíte?”\r\nOzve sa mladý policajt:\r\n”Ihneď vykonám rekonštrukciu zločinu!”              ', 304, 4.08, 36),
	(8619, 'Mestská polícia prijíma nových strážnikov. Skúšajú prvého adepta:\r\n”Koľko je dve a dve?”\r\n”Tri.” odpovie adept.\r\n”Rozmyslite si to!”\r\n”Tak... päť.”\r\n”No, neuhádli ste, ale snažili ste sa. Tak vás prijímame.”\r\nDruhý uchádzač dostane tú istú otázku:\r\n”Koľko je dve a dve?”\r\n”Tri.” odpovie adept.\r\n”Rozmyslite si to!”\r\n”Tri!” trvá na svojom  uchádzač.\r\n”No, neuhádli ste, ale stojíte pevne za svojím názorom. Tak vás prijímame.”              ', 512, 4.1, 36),
	(8620, 'Policajt vyzýva vodiča škodovky:\r\n”Pán vodič, tu je sonda, fúkajte!”\r\nVodič odmieta.\r\n”Vravím vám, fúkajte!”\r\n”Nebudem.” oponuje vodič. Policajt sa naštve a vraví:\r\n”Fúkajte, lebo keď do tej sondy fúknem ja, tak nedostanete späť vodičák do konca života!”              ', 305, 4.05, 36),
	(8621, 'Do reštaurácie prišiel policajt v civile a vyslovil svoje prianie: \r\n"Prosil by som si šišky a čaj." \r\n"Šišky nemáme," ohlásila vedúca. \r\n"Tak šišky a kávu." \r\n"Veď vám vravím, že šišky nie sú." \r\n"Dobre, tak šišky a kakao." \r\nVedúca bežala k telefónu, vytočila priamu linku náčelníka, pretože príslušníka v civile veľmi dobre poznala a zúfalo vraví: \r\n"Pán náčelník, prosím vás, ihneď sem príďte, lebo sa zbláznim, mám tu problémy s jedným vašim podriadeným." \r\nNáčelník pribehol za pár minút, poslal príslušníka preč: \r\n"Tak čo vlastne vyviedol?" \r\nVedúca začala trpezlivo vysvetlovať svoje utrpenie: \r\n"Chcel šišky a čaj, ja mu vravím, že šišky nemáme a on, že teda chce šišky a kávu. Ja mu znovu vravím, že šišky nie sú a on na mňa vybafne, aby som mu dala šišky a kakao. To je hrôza, čo?" \r\nNáčelník sa rozčúlil a začal kričať: \r\n"To je blbec, čo? Mala ste tie šišky vziať a omlátiť mu ich o hlavu!"              ', 1019, 4.19, 36),
	(8622, 'Idú dvaja policajti po ulici a nájdu zrkadlo. Jeden z nich ho zdvihne a hovorí: \r\n- Jéj, to je moja fotka!\r\nDruhý mu zrkadlo vezme a nadáva mu: \r\n- Ty blbec, veď to je moje fotka! \r\nTak sa tam hádajú a nakoniec idú za šéfom. Ten vezme zrkadlo a vraví: \r\n- Páni, tak toto je moja fotka. - a strčí si zrkadlo do vrecka. \r\nPríde domov, vyzlečie sa a zrkadlo mu vypadne. Zodvihne ho jeho dcéra a začne kričať: \r\n- Mami, tatko má nejakú ženskú! Pribehne jeho stará, schmatne zrkadlo a znechutene vraví: \r\n- Fuj, tá je ale škaredá!              ', 570, 4.05, 36),
	(8623, 'Príde policajt v pondelok do papierníctva a pýta si hviezdičkovaný papier. Predavačka hľadá: ”No viete, máme čistý, linajkový aj štvorčekový, ale hviezdičkovaný nie.” \r\nPolicajt odíde, na druhý deň príde znova a pýta si atrament na veľké písmena. Predavačka sa už trošku čuduje, ale hľadá a nakoniec hovorí: \r\n”No, máme modrý, zelený, čierny aj červený, ale atrament špeciálne na veľké písmena - to nemáme.” \r\nPolicajt sklamaný odíde. Na tretí deň príde samotný náčelník, obzerá sa po obchode a predavačka mu vraví: \r\n”Viete, pán náčelník, robte s tými svojími podriadenými niečo, predvčerom tu bol jeden\r\nz nich a chcel hviezdičkovaný papier, včera tu bol znova a chcel atrament na veľké písmena. Nikdy som o ničom takom nepočula.” \r\nNáčelník sa usmeje popod fúzy: \r\n”Ale, z toho si nič nerobte, to bol amatér, ale keď, už som tu, nemáte náhodou glóbus Európy?”              ', 977, 3.88, 36),
	(8624, 'Policajti na obchôdzke v meste našli opicu, nevedeli čo s ňou, tak ju chytili a zobrali na policajné oddelenie a išli k načelníkovi. "Pán načelník, našli sme v meste opustenú opicu a nevieme, čo s ňou". Načelník hovorí: "no čo, čo zoberte ju predsa do ZOO". Po práci sa vracia načelník domov, kráča si po meste a zrazu vidí tých dvoch ako držia za ruku opicu a veselo si vykračujú. "Veď som vám hovoril, že ju máte zobrať do ZOO!", hovorí načelník. "Pán načelník, v ZOO sme už boli a teraz ideme do kina!"              ', 561, 3.6, 36),
	(8625, 'Raz prišiel do práce nahý policajt. Keď to uvidel jeho šéf, zavolal si ho do kancelárie a pýta sa:\r\n- Novák, čo je to?\r\n- No, ja som bol včera na mejdane.\r\n- No a???\r\n- Po polnoci, keď sme všetci tancovali zrazu zhaslo svetlo a ozval sa hlas: “Tak, dámy, vyzliekame sa.” Ženy sa vyzliekli a tancovalo sa ďalej. Po chvíli zase zhaslo svetlo a ozval sa hlas: “Tak, páni, vyzliekame sa.” Tak sme sa vyzliekli a tancovalo sa ďalej. Potom tretíkrát zhaslo svetlo a ozvalo sa: “Tak, páni, do práce.” No, a tak som tu.              ', 560, 4.22, 36),
	(8626, 'Policajt príde k lekárovi s bolesťami brucha. Lekár ho prehliadne a predpíše mu čípky. Policajt príde domov a všetky čípky zje. Na druhý deň príde zase k lekárovi s ešte väčšími bolesťami brucha, tak mu lekár predpíše ešte silnejšie čípky. Policajt príde domov a opäť všetky zje. Ďalší deň je zase u lekára. Lekár hovorí:\r\n- Tak ja vám teda dám supersilný čípok.\r\nPolicajt príde domov a zase čípok zje. Ďalší deň už lekárovi dochádza trpezlivosť a podráždene hovorí:\r\n- Človeče, vy snáď tie čípky žeriete alebo čo?!\r\nA policajt podráždene odpovedá:\r\n- Nie...! Pchám si ich do prdele!              ', 668, 4.23, 36),
	(8627, 'Policajt dostane prvýkrát v živote baterku. Na druhý deň príde do roboty a je celý nešťastný. Šéf sa ho pýta že prečo. Mám taký problém, keď baterku zapnem, svetlo je tam. Ale keď ju vypnem, kam to svetlo ide? Rozobral som\r\ncelú baterku a nebolo tam!\r\nŠéf: No tak na to sa ja musím pozrieť! Na druhý deň príde šéf vysmiaty do roboty.\r\nPolicajt: Tak ako šéfe?\r\nŠéf: Všetko som zistil a vypátral! Najprv som vyhnal z bytu ženu a deti a potom som pozaťahoval závesy, aby ani kúsok svetla neprenikol dovnútra.Zapol som baterku, svetlo bolo tam! Vypol som ju a začal som svetlo hľadať\r\npo celom byte.A vieš, kde sa ta sviňa ukryla? V CHLADNIČKE!\n', 688, 4, 36),
	(8628, 'Príde malý Janko za policajtom ktorý ridi križovatku a pýta sa ho : ujo máte chvíľku čas niečo sa vás chcem spýtať ? Policajt nato len sa pýtaj chlapče. Malý Janko mu niečo pošušká do ucha a policajt ho zato začne veľmi biť pelendrekom. Okolo stojaci ľudia sa veľmi rozhorčujú že policajt ako strážca zákona by mal deti ochraňovať a nie biť pelendrekom. Policajt im na to hovorí keby vám povedal to čo povedal mne aj vy by ste ho vyťali. A čo vám povedal, pýtajú sa ľudia. Že ak mám chvíľku čas, aby som mu šiel napáriť sučku že chce mať žandárske psy!              ', 622, 4.05, 36),
	(8629, 'Pani učitelka sa pýta detí ako robia zvieratá:\r\n-"Ako robí psíček Anička?"\r\n-"Hav, hav."\r\n-"A ako robí sviňa Dežko?"\r\n-"Dobrý deň, pán vodič tu je cestná kontrola, ukážte prosím vodičský preukaz!"', 217, 3.55, 36),
	(8630, 'Po ceste ide kňaz na bicykli,ale ide bezdržiačky, pretože má späté ruky a modlí sa. Zastaví ho policajt a vraví: " Otče to bude za 10 korún, pretože na bicykli sa nesmie jazdiť bezdržiačky". Pán farár na to: " Pán policajt, ale mňa vedie môj anjel strážny". A policajt na to: "Tak to bude za 20, pretože na jednom bicykli dvaja ísť nemôžu"', 367, 3.56, 36),
	(8631, 'Vieš,koľko existuje vtipoch o policajtoch?\r\nŽiadne, všetko je pravda!', 73, 3.63, 36),
	(8632, 'Jeden policajt druhému:\r\n-Smrdíš potom.\r\n-A ty teraz!', 56, 3.08, 36),
	(8633, 'Príde červený mužíček do baru a hovorí: "Ja som červený mužíček, pijem len červený chlast iba z červeného pohára". Príde modrý mužíček do baru a hovorí: "Ja som modrý mužíček, pijem len modrý chlast iba z modrého pohára". Príde zelený mužíček do baru a čašník hovorí:"Ty si zelený mužíček a chceš zelený chlast zo zeleného pohára". "Nie ja som policajt a prosím si Vaše doklady".', 428, 3.47, 36),
	(8634, 'Viete prečo sa policajti pred dverami vždy poserú? Lebo je na nich napísané tlačiť.', 90, 3.45, 36),
	(8635, ',,Viete prečo sa policajti pri búrke usmievajú" Lebo si myslia že ich niekto fotí!', 87, 3.92, 36),
	(8636, 'Zastaví policajt vodiča a vidí biely sáčok a v tom sáčku biely prášok. Policajt otvori sáčok, ochutná a pýta sa vodiča: "Heroín?". \r\nA vodič na to: "Nie otrava na myši."', 186, 3.5, 36),
	(8637, '- Viete aký je rozdiel medzi policajtom a holubom???\r\n- Žiadny, všetko poserú, ale strieľať sa nemôžu...', 112, 3.73, 36),
	(8638, '- Viete prečo majú policajti zeleno-biele auto? - Aby videli na kľučku.', 75, 2.67, 36),
	(8639, '- Viete prečo majú policajti na dverách zelenú pásku?- Aby videli na ľučku.- A viete prečo vždy meškajú na konferencie?- Lebo zvnútra tú pásku nemajú.', 165, 3.9, 36),
	(8640, 'Príde policajt do bufetu a povie:\r\n- Dobrý deň, jedny hranolky prosím. \r\n- Prepáčte prosím Vás, nemáme zemiaky. \r\n- Mne to nevadí, ja to zjem aj s chlebom.', 165, 3.78, 36),
	(8641, 'Príde pani na políciu a kričí: "Znásilnil ma malomyselný muž." br />Policajt jej hovorí: "A ako viete, že bol malomyselný?" br />"Lebo som mu musela všetko vysvetľovať."', 182, 2.82, 36),
	(8642, 'Policajt so zbraňou kričí na zlodeja:\r\n"Stoj, lebo sa netrafím!"', 68, 3.92, 36),
	(8643, 'Stretli sa Rus, Nemec a Slovák. Stavili sa kto vydrží najviac v mravenisku. Prvý išiel Rus a vydržal 1 hodinu. Ide Nemec a on vydrží 2 hodiny. A išiel Slovák a ten vydržal 1 rok, 2 roky, 3 roky. Slovák vyšiel potom von a pýtali sa ho ako mohol vydržať tak dlho? "Ja som zabil jedného a všetci mu išli na pohreb."', 331, 3.48, 36),
	(8644, 'Poicajt zastaví vodiča autobusu.\r\nPolicajt: "Cigarety, alkohol, drogy?"\r\nVodič: "Jednu kávu prosím!"', 105, 3.86, 36),
	(8645, 'Policajt zastaví auto. "Pani, prekročili ste 90-tku." "Ó, to nie, to iba v tomto klobúku vyzerám tak staro."', 113, 3.85, 36),
	(8646, 'Prečo policajti chodia so psami?\r\nViac hláv, viac rozumu.', 59, 3.45, 36),
	(8647, 'Dvaja policajti chľascú ako obyčajne a keď sa trochu preberú jeden hovorí: \r\n-Pozri ako vyzerám, celý zagrcaný a špinavý. Keď sa ukážem žene, tak ma zabije!\r\n-Neboj - hovorí mu druhý - povieme, že sme boli na akcii v krčme kde bola bitka, a keď sme pacifikovali tých ožranov, čo sa bili, tak nás jeden ogrcal!\r\n-Fajn, tak aj poviem.\r\nKeď prišiel domov, žena hneď vo dverách sa pustila doňho, ale on tak ako sa dohodli hovorí:\r\n- Žena daj pokoj, v krčme bola bitka, náčelník nás tam poslal a keď sme pacifikovali tých bitkárov, tak nás jeden ogrcal!\r\n- Naozaj, prisahaj?!\r\n- Prisahám!\r\n- Tak sa vyzleč v kúpeľni, nech to dám prať.\r\nKeď sa povyzliekal prešiel do obývačky, po chvíli žena naň kričí z kúpelne:\r\n- A dal si mu aspoň pokutu?\r\n- Jasné 500 korún.\r\n- Mal si mu dať 1000, lebo ti aj do gatí nasral!', 867, 4, 36),
	(8648, 'Idú dvaja policajti po meste, keď na hodinách odbije poludnie. Vytiahnú teda jedlo. Jeden ide na druhú stranu ulice. Keď sa vráti, druhý sa ho pýta: "Prečo si šiel na druhú stranu ulice?""Lebo zubár mi povedal, že mám jesť na druhej strane."   ', 260, 3.25, 36),
	(8649, 'Idú dvaja policajti na nočnú obchôdzku, keď zrazu uvidia ako zo zlatníctva kradnú šperky. Jeden policajt hovorí druhému: "Nezasiahneme?"Druhý mu odvetí: "Čo si rozum potratil? Však oni sú dvaja a my sme sami."', 224, 3.37, 36),
	(8650, 'Policajti stopujú autá a rozdávajú peniaze za slušnú jazdu! Zastavia BMW a dajú vodičovi 2000 korún za slušnú jazdu.\r\nVodič: "Dík za peniaze, už dávno som si chcel spraviť vodičák."\r\nJeho manželka: "Ale nevšímajte si ho, keď si trochu vypije trepe samé hlúposti."\r\nBabka sa ozve zo zadu: "Ja som vám vravela, že sme nemali ísť na ukradnutom aute.\r\nZ kufra sa ozve: "Už sme za hranicami?"     ', 421, 3.94, 36),
	(8651, 'Policajt zastaví šoféra a hovorí:\r\n- Budete fúkať!\r\n- Rád. Kde Vás bolí?\r\n', 83, 3.94, 36),
	(8652, '- Modlíte sa doma vždy pred jedlom? - pýta sa policajt kole- Nie, prečo? Moja žena varí výborne.', 103, 3.13, 36),
	(8653, 'Policajt rýchlo vbehne do električky a kričí na vodiča: "Rýchlo, sledujte ten taxík!"', 92, 3.3, 36),
	(8654, 'Sedia dvaja policajti pri stole, a v tom jeden zaklope na stôl. \r\nPrvý sa postaví a hovorí: "Niekto klopal, idem otvoriť."\r\nv tom druhý hovorí: "Nie seď, ja som klopal, ja idem otvoriť."', 195, 3.56, 36),
	(8655, 'Idú dvaja policajti na bicykloch po prašnej ceste, keď sa zrazu začne jednému z nich na prednom kole odchlipovať duša. Zavolá rýchlo na kolegu:\r\n"Jožko, počkaj,nemôžeme ísť ďalej - kolí sa mi kolo!"\r\nZlezú teda z bicyklov, prikryjú ho handrou, sadnú si do priekopy a čakajú hodinu, dve...\r\nZa ďalšiu hodinu ide okolo náčelník a pýta sa:\r\n"Kolegovia, čo tu tak sedíte? Prečo nejdete ďalej?"\r\n"Pán náčelník, nemôžeme. Kolí sa mi kolo... Musíme počkať."\r\nNáčelník ide k bicyklu, zdvihne handru a riadne sa pozrie. Otočí sa na svojich podriadených a vraví:"Omyl páni, ten bicykel je pánsky..!"', 640, 3.17, 36),
	(8656, 'Ide policajt v službe po námestí, keď tu naraz uvidí uprostred námestia veľké hovno.\r\nNevie rýchlo čo s tým má robiť, a tak aby nebolo na námestí, rýchlo si dá dole čiapku a prikryje ho.\r\nO hodinu ho v službe vystrieda kolega. Príde na to isté námestie a uprostred uvidí čiapku kolegu.\r\nVraví si pre seba:\r\n"Joj, kolega tu stratil čiapku. Zoberiem mu ju, bude rád..."\r\nNadvihne čiapku, uvidí hovno pod ňou a vraví:\r\n"Joj, kolega tu nechal aj mozog..."', 482, 3.55, 36),
	(8657, '- Viete prečo policajti vychádzajú, keď sa blýska, von?- Lebo si myslia, že ich fotia.', 92, 2.6, 36),
	(8658, 'Náčelník polície si kúpil trezor, zavolal podriadených a hovorí:\r\n- Toto je najbezpečnejší trezor na celom svete. Má 80-miestny kód. Sú to samé 4, ale nepoviem vám v akom poradí. ', 195, 3.77, 36),
	(8659, 'Policajt odovzdáva služobného psa. Nový majiteľ si ho prezerá a hovorí: - Je to naozaj krásny pes, ale prečo má tu plešinu na hlave?- Tam mal namontovaný majáčik.', 176, 2.75, 36),
	(8660, 'Sedia dvaja policajti na stanici. Jeden zaklope na stôl a druhý povie: "Idem otvoriť.""Seď, ja som klopal ja idem otvoriť."', 128, 4.1, 36),
	(8661, '4 policajti sa hádajú, ktorý z nich bude sedieť pri okne. ', 62, 3.52, 36),
	(8662, 'Viete prečo majú policajti v policajnom aute chladničku? Aby si zachovali chladnú hlavu.', 92, 4, 36),
	(8663, 'Vodič vidí pri ceste stopára, ktorý je celý žltý. Zastaví a pýta sa:\r\n"Kto si a čo chceš?"\r\n"Ja som malý žltý trpaslík a som strašne hladný."\r\nNa sedadle má desiatu, tak mu ju hodí a uháňa ďalej. Zrazu vidí pri ceste stopára, celého modrého. Zastaví teda a spýta sa:\r\n"Kto si a čo chceš?"\r\n"Ja som malý modrý trpaslík a som strašne smädný."\r\nZo sedadla hodí po ňom plechovku Coly a pokračuje v ceste. Po chvíli jazdy naňho kýva ďalší stopár, celý v zelenom. Zastaví a pýta sa:\r\n"A ty čo chceš ty malý zelený trpaslík?"\r\n"Doklady prosím!"', 592, 4.22, 36),
	(8664, 'Prechádzajú sa policajti Jano a Fero. Pri neďalekom jazierku uvideli starého baču, ako dojí kravu.\r\nJano: "Heh, pozri Fero, ten bača si tam dojí kravu a my jak sprostý kupujeme každé ráno drahé mlieko."Fero: "Počuj Jano. Kúpme si aj my kravu a každý deň budeme mať na stanici čerstvé mlieko."\r\nPolicajti kúpili kravu a na druhý deň ráno na stanici sa hneď pustili do práce. Po chvíľke dohadovania sa dohodnú na tom, že Fero ju podojí.\r\nFero po 10-tich minútach: "Ty Jano, počúvaj!!! Dojím tú kravu už 10 minút a zatiaľ žiadne mlieko."\r\nJano: "Viem kde je problém! Spomeň si ako to robil bača. Krava mala hlavu vo vode, nasávala vodu a on z nej hneď dojil mlieko."\r\nFero: "Ide sa ku vode!"\r\nPolicajti prídu ku riečke, nastavia kravu ku vode a tá hneď začala piť jak divá. Policajti celí natešení vrhli sa na dojenie čerstvého mlieka. \r\nFero: "Jano počuj, zatiaľ žiadne mlieko! Vysadni krave na hlavu a vtlač jej hlavu pod vodu."\r\nJano teda vysadne krave na hlavu, a hlavu jej po papuľu strčí pod vodu.\r\nFero po 5-tich minútach: "Nič! Stlač jej hlavu ešte hlbšie."\r\nJano pritlačí a krave celú držku ponorí pod vodu. Fero zase po 5-tich minútach: "Ešte hlbšie, stále nič nedáva."\r\nJano sa zaprie, krave vtlačí hlavu až po oči do vody. Krava sa v panickom strachu poserie a Fero na to: "Vyššie Jano, už nasáva blato!!!"', 1404, 4.08, 36),
	(8665, 'Prečo ma policajt vystrčenú motorovú pílu z okna auta?\r\nAby dobre rezal zakruty\r\n', 86, 3.55, 36),
	(8666, 'Dvaja policajti na pohrebe. Všetci hádžu kvety a zrazu veľká rana o rakvu. Jeden policajt sa pýta: "Počuj, to čo bolo."A druhý na to: "Vieš, v obchode nemali kvety, tak som kúpil dezert." ', 199, 4.04, 36),
	(8667, 'Policajt vo väzení hovorí väzňom:\r\n"Kto skočí 2 metre do dĺžky, nedám ho zabiť, ale odmením ho chlebom."\r\nPrvý skáče a skočí meter. Neskočil dva metre, tak policajt hovorí: "Dajte mu chlieb."\r\nDruhý skáče, skočí 1,5 metra. Neskočil dva metre, tak policajt hovorí: "Dajte mu chlieb."\r\nTretí skáče, preskočí ju celý vytešený. Policajt hovorí: "Zabite ho, ten by mohol ujsť."', 408, 3.93, 36),
	(8668, 'Idú dvaja policajti do obchodu. Jeden z nich vojde a druhý čaká vonku. Keď vyjde, povie druhému: "Keď uhádneš, koľko banánov som kúpil, dostaneš oba."', 163, 3.33, 36),
	(8669, 'Príde policajt do reštaurácie a vypýta si jednu pizzu. Čašníčka sa ho pýta:A na koľko častí ju chcete? Na šesť alebo dvanásť?A policajt odpovie: Dajte mi na šesť, dvanásť by som už nezjedol.', 211, 3.33, 36),
	(8670, 'Idú dvaja policajti v aute. Zrazu zastavia. Šofér vraví spolujazdcovi: "Choď sa prosím ťa pozrieť, či nám svietia smerovky."Policajt vyjde von, postaví sa za auto a vraví: "Svietia, nesvietia, svietia, nesvietia..."\r\n', 229, 2.88, 36),
	(8671, 'Prečo policajti tancujú na zastávke MHD?\r\nLebo prišla harmonika...', 70, 2.82, 36),
	(8672, '- Viete prečo sa policajti nehrajú na schovávačku???\r\n- Veď ktorý hlupák by ich hľadal?', 95, 3, 36),
	(8673, 'Fízel sa prechádza po parku a sadne si na lavičku. Hovno naňho kričí:"Nazdar kolega!"\r\n"Aký som ti ja kolega, ty hovno jedno?!"\r\n"To vieš, ty si zvnútra, ja som zvnútra..."', 182, 3.73, 36),
	(8674, 'Ako vznikol policajt?\r\nPolymerizáciou monocajta.', 49, 3.22, 36),
	(8675, 'Jožko hovorí Katke:\r\n- Polícia hľadá osobu, ktorá je pekná, šarmantná, milá a dobrosrdečná, takže ty si v bezpečí. Ale kam sa mám skryť ja?', 156, 3.73, 36),
	(8676, 'Idú dvaja na koči a zastaví ich policajt. Pýta sa ich:\r\n- Čo v tom koči nesiete?\r\n- Banánovu šťavu.\r\n- A to je čo? Niečo ako malinovka?Môžem to ochutnať?\r\n- Veď môžte.\r\n-Hmmm... je to dobré... Dobre, tak môžete ísť.\r\n A chlap sa ozve:\r\n-Banán hijóó!', 274, 3.55, 36),
	(8677, 'Idú dvaja policajti. Prvý hovorí: "Pozri, zdochnutá vrana!" Druhý vyvráti hlavu k nebu a pýta sa: "Kde?"', 111, 3, 36),
	(8678, 'Ide blondínka v aute, zastaví ju policajt a vraví jej: "Pani, prekročili ste 50".A blondínka vraví: "Ja viem, to ma ale len ten klobúk robí staršou."', 158, 3.73, 36),
	(8679, 'Jeden policajt hovorí tomu druhému: "Kupil som si puzle na, ktorých bolo napísané do 3 rokoch, a ja som ich poskladal za 3 mesiace."', 137, 3.67, 36),
	(8680, 'Veliteľ hovorí policajtovi:" Toto je najstráženejší trezor na celom Slovensku. Je to šesťmiestny kód, samé štvorky, ale poradie vám nepoviem."', 154, 3.96, 36),
	(8681, ' Ako policajt zistí, že je pekný? Zodvihne telefón a spýta sa: "Kto je najkrajší na svete?" \r\nA telefón: "Ty, ty, ty."\r\n', 128, 3.09, 36),
	(8682, 'Dvaja policajti idú autom, chvíľa nepozornosti a nabúrajú do stromu.\r\nTen čo neriadil, vraví kolegovi: "Peťo, toto musíme osláviť."\r\n"Nerozumiem." - odpovedá mu druhý.\r\n"Musíme to osláviť, takto rýchlo sme na mieste nehody ešte nikdy neboli."', 260, 3.61, 36),
	(8683, 'Príde policajt ráno do práce a hovoví:\r\n- Mám syna.... je to chlapec..', 75, 3.52, 36),
	(8684, 'Dvaja policajti idú po lese a zrazu zbadajú v kríkoch ľudskú hlavu. Jeden z nich bol nižší, zdvihol hlavu a hovorí: „Ty počúvaj, to je strašné, mám taký dojem, že tá hlava patrila nášmu náčelníkovi!“\r\n“Ukáž“, vraví druhý, ktorý bol vyšší a zdvihne hlavu dohora.\r\n“Nemáš pravdu, našťastie to nie je náš náčelník, ten nebol taký vysoký!“\r\n', 390, 3.5, 36),
	(8685, 'Príde natešený policajt do stanice a hovorí: "Ja som si kúpil puzzle, na ktorom bolo napísané od 2 do 5 rokov. A ja som to poskladal len za 1 rok!"', 154, 4.03, 36),
	(8686, 'Policajt hovorí:\r\n- Zomrel nejaký muž.\r\n- Musíme zistiť na čo zomrel!\r\nDruhý policajt mu odpovedá:\r\n- Na to, aby sme mali viac roboty.', 142, 3.92, 36),
	(8687, '- Koľko musí Slovenský policajt piť, aby mal v krvi 0,5 promile alkoholu???\r\n- 3 dni nič.', 94, 3.68, 36),
	(8688, '- Viete prečo si policajti stavajú okrúhle domy?\r\n- Aby ich za rohom nikto nemohol prepadnúť.\r\n', 100, 3.67, 36),
	(8689, 'Ide farár na bicykli a zastaví ho policajt:\r\n- No pán farár a kde máte prilbu?To bude pekných 50 €...\r\n- Ale ja prilbu nepotrebujem, mňa ochraňuje anjel strážny.\r\n- Aha..?! Takže ste na bicykli dvaja, tak to máme 100 €..!', 237, 4.18, 36),
	(8690, 'Prečo policajti vozia v aute pílu?          \r\nAby mohli rezať zákruty.', 74, 4.13, 36),
	(8691, 'Zasadanie mestského zastupiteľstva v Žiline po pamätnej tabuli dr. Tisa uvažuje o novom skrášlení mesta. \r\n- Ja navrhujem postaviť na hlavné námestie sochu slovenského roľníka. Naše mozole si treba ctiť - hovorí jeden z mestských poslancov\r\n- Ale ten roľník musí byť v národnom kroji - dodáva ďalší\r\n- A v rukách by mal mať vidly, aby Maďari vedeli, že sa nedáme - hovorí tretí\r\n- A ešte lano so slučkou pre nich, aby bolo jasné kto je tu nepriateľ.\r\n- A aby to bolo ešte jasnejšie, v tom lane by sa mal hompáľať Maďar - buchne rukou do stola ďalší SNS-ák\r\n- Ja nedbám, - zaradí sa do diskusie posledný - len by sme mohli tých Maďarov meniť každý deň!', 708, 3.31, 37),
	(8692, 'Aký je rozdiel medzi WC a našim parlamentom?\r\nŽiadny. Zvuk počuješ a obsah uniká.', 87, 3.85, 37),
	(8693, 'Nových sedem pádov slovenskej postkomunistickej gramatiky:\r\n8. pád	Kto z koho...  korytatív\r\n9. pád	Kto - koho...  likvidatív\r\n10. pád	Kto – kedy...  prokuratív\r\n11. pád	Koho – kam...  deliminatív\r\n12. pád	Komu – koľko...kriminatív\r\n13. pád	Koho – s kým...konkubinatív\r\n14. pád	Koho – ako...  buzeratív\n', 331, 3.56, 37),
	(8694, 'Príde minister za Mao-ce-Tungom a hovorí:\r\n"Pane, napadli nás Slováci!"\r\n"A koľko ich je?"\r\n"5 miliónov."\r\n"A v ktorom hoteli bývajú?"', 142, 3.42, 37),
	(8695, 'Čo robí izraelské dievčatko, keď sa hojdá na hojdačke?\r\nDráždi palestínskeho ostrelovača. ', 101, 3.34, 37),
	(8696, 'Aký je rozdiel medzi poslancami a holubmi?\r\nŽiadny. Zvysoka na nás serú a strielať ich je zakázané!', 106, 3.65, 37),
	(8697, 'Jedna nula neznamená nič, ale ak sa stretne núl 150, máme pokope celý slovenský parlament.', 96, 3.4, 37),
	(8698, 'V Afganistane idú v aute dvaja Talibovia. Jeden hovorí druhému: \r\n- Vieš ty čo? Vyhoď ma pred americkým veľvyslanectvom.', 128, 3.11, 37),
	(8699, 'Po ulici ide poslanec a zrazu počuje, ako si bezdomovec šomre:\r\n- Musím vyžiť z dávok...\r\nA keď to poslanec počuje, tak mu povie:\r\n- No vidíš a ja musím vyžiť z poslaneckého platu.', 194, 3, 37),
	(8700, 'Ľudí delíme na dve kategórie:\r\n1. budovatelia demokracie\r\n2. užívatelia demokracie', 88, 2.96, 37),
	(8701, 'Príde dôchodca za premiérom a pýta sa:\r\n- Synu, to už máme ten kapitalizmus, alebo bude ešte horšie?', 108, 3.17, 37),
	(8702, 'Za hlbokej totality na námestí SNP ukončil mierne unavený hosť najbližšiu reštauráciu okolo 4 hodiny nad ránom. Náhle začal vykrikovať: \r\n- Kde je ten Sovietsky zväz, kde je ten Sovietsky zväz?\r\nPríslušník VB k nemu pristúpil a spýtal sa ho o čo mu ide. Hosť reštaurácie iba stále opakoval: \r\n- Kde je ten Sovietsky zväz, kde je ...\r\nKeď sa ho príslušník VB dôraznejšie opýtal, že načo mu je ZSSR, ten mu odpovedal: \r\n- Aby som sa mohol o niečo pevné poriadne oprieť!', 505, 3.05, 37),
	(8703, 'Tatranský maco vojde do hotela v Poprade a pri bare si objedná borovičku. Barman mu ju podá a čuduje sa:\r\n- To sa mi ešte nestalo, aby si medveď objednal borovičku.\r\nMaco zamručí:\r\n- Niet sa čo čudovať pri týchto cenách.', 235, 3.37, 37),
	(8704, '- Vraj sa prerába biblia.\r\n- Prečo by sa mala biblia prerábať?\r\n- Pretože chlieb tak zdražel, že už je ťažké dodržať zásadu: Kto do teba kameňom, ty do neho chlebom.', 180, 3.44, 37),
	(8705, 'Zásada ponovembrových vlád:\r\nČo môžeme zdražiť dnes, neodkladajme na zajtra!', 84, 3.6, 37),
	(8706, 'TASR(Bagdad):\r\nAvizovaný nástupca irackého prezidenta Saddáma Huseina, jeho syn Kusain Husein včera v Bagdade prehlásil, že po nástupe do prezidentského kresla hodlá zmeniť irackú štátnu hymnu. Podkladom pre novú hymnu sa stala pieseň Michaela Jacksona "Heal the World" avšak so zmeneným textom a názvom "Kill the world!".\n\r\nTASR(Pásmo Gázy):\r\nPalestínsky predák Jásir Arafat sa podľa vzoru irackého prezidentského nástupcu Kusaina Huseina rozhodol taktiež zmeniť štátnu hymnu. Arafat si ako základ pre novú hymnu vybral pieseň kráľovnej popu Madonny "Don\'t cry for me Argentína" avšak tiež sa rozhodol zmeniť text a nová hymna bude niesť názov "Don\'t cry for me Palestína". Predák palestínčanov sa tak rozhodol po včerajšom samovražednom bombovom útoku extrémistu Huhamada al Fakera, ktorý vyhodil do vzduchu židovskú farmársku usadlosť neďaleko pásma Gázy. Pri incidente prišlo o život 78 kôz.', 959, 2.87, 37),
	(8707, 'Stretnú sa nemecký, americký a slovenský ministri sociálnych veci v Amerike, stretnú sa s občanmi, a tak sa pýtajú amerického dôchodcu čo mu dovolí výška dôchodku:\r\nAmerický dôchodca: \r\n- No môžem ísť na dovolenku 2x do roka, 1x do roka vymením auto za nové, a slušne žijem.\r\nO rok sa zídu v Nemecku, a znova sú medzi občanmi:\r\nNemecky dôchodca: \r\n- No raz do roka ideme s babkou na dovolenku a raz za dva roky si kúpime nové auto.\r\nO rok má byť stretnutie na Slovensku, minister navštívi dôchodcu a dohodne sa sním čo bude odpovedať štátnikom pri otázkach. A tak keď oslovia dôchodcu, čo si môže dovoliť z dôchodku, slovenský dôchodca odpovedá:\r\n- Náš minister mi povedal, že si môžem kúpiť raz do roka rekreáciu, a raz za tri roky auto, ale my sa s babkou uskromníme, odložíme si tie peniaze bokom, lebo babka potrebuje na zimu nové papuče.', 908, 3.55, 37),
	(8708, 'Viete aký je najlepší politický vtip?\r\nTaký, na ktorom sa smejete aj po 20 rokoch, až sa za mreže chytáte!', 114, 3.5, 37),
	(8709, 'Viete čo išiel robiť Pilip na Kubu?\r\nZaložiť kapelu. Bubeníka mal so so sebou. Basu mu dal Fidel a noty Američania.', 122, 2.62, 37),
	(8710, 'Zakladám kapelu. Bubeníka už mám. \r\nFIDEL', 45, 3.48, 37),
	(8711, 'Kedysi platilo, keď chceš dať niekomu jesť nauč ho loviť ryby. \r\nDnes platí zamestnaj ho na úrade práce.', 113, 2.84, 37),
	(8712, 'Rok 2250. Na chodbe Národnej rady sa prechádzajú dvaja Rómovia. \r\n- Dežo, tak čo budeme robiť s tou slovenskou otázkou?', 127, 2.82, 37),
	(8713, 'Jeľcin a Clinton sa dajú zmraziť na 50 rokov.Po rozmrazení si vypýtajú noviny.Prvý číta Jeľcin a smeje sa:\r\n"Ha, ha-piaty zjazd komunistickej strany v USA."\r\nPotom noviny zobere Clinton a vybuchne od smiechu.\r\n"Čo sa smeješ?"\r\n"Ale nič, len žiadne nové konflikty na fínsko-čínskych hraniciach."', 312, 3.21, 37),
	(8714, 'Přijde pán do drogérie a chce něco proti myším. Prodavač mu doporučí speciální robomyšku, kterou doma ve sklepě vypustí. Ona běhá, živé myšky vylezou a běhají za ní. Až vylezou všechny, skočí robomyška do potoka, ostatní za ní a utopí se.I jde znovu pán do drogérie a už od dveří křičí:\r\n"To bylo fantastické - a nemáte náhodou robokomunistu?"', 384, 3.76, 37),
	(8715, 'Vieš, prečo majú dopraváci  okolo auta čierny pás? Aby sa vedeli ožratí  trafiť do kľúčovej dierky.\r\nA vieš prečo ho majú okolo celého auta ? Aby to nemali také ľahké. ', 187, 3.13, 37),
	(8716, 'Je to červené a krúti sa to. Čo je to?\r\nKomunista vo víre transformácie.', 78, 3.09, 37),
	(8717, 'Viete prečo policajt dáva na televízor štipľavú papriku ?\r\nLebo chce mať ostrý obraz.', 93, 3.26, 37),
	(8719, 'Víte jaký je rozdíl mezi politiky a holuby?\r\nŽádný, na všechno serou a střílet se po nich nesmí.', 106, 3, 37),
	(8720, 'Priemerný plat Američana je 6000 dolárov. Za stravu, nájomné, elektrinu, plyn a vodu, kultúru, benzín a ostatné nevyhnutné náklady vydá mesačne približne 4000 dolárov. Čo urobí s tými 2 000 dolármi, o to sa vláda nestará. Priemerný plat Nemca je 4000 mariek. Za stravu, nájomné, elektrinu, plyn a vodu, kultúru, benzín a ostatné nevyhnutné náklady vydá mesačne približne 2500 mariek. Čo urobí s tými  1500 markami, o to sa vláda nestará. Priemerný plat Slováka je 9000 korún. Za stravu, nájomné, elektrinu, plyn a vodu, kultúru, benzín a ostatné nevyhnutné náklady vydá mesačne približne 11000 korún. Kde zoberie tých 2 000 korún, o to sa vláda nestará.', 707, 4.25, 37),
	(8721, 'Ide nemenovaný vodca Slovenskej politickej strany po ulici a oproti nemu ide číňan. Tak sa naňho pozrie a ohriakne ho:\r\n"Čo sa smeješ, ty Maďar!"', 153, 3.28, 37),
	(8722, 'Na živote na Slovensku milujem hlavne tú rozmanitosť. Každý deň ma naserie niečo iné...', 95, 3.19, 37),
	(8723, '"Pán vodič, nesvieti vám vzadu heligónka."\r\n"Snáď halogénka?"\r\n"Vy ste mi nejaký suvenír."', 99, 3.42, 37),
	(8724, 'Viete aká je ideálna váha politika?\r\n3,5 kg! Aj s urnou.', 59, 3.45, 37),
	(8725, 'George Bush vystupuje pred Bezpečnostnou radou OSN a presviedča ich o nevyhnutnoti útoku na Irak. V rozprave sa prihlási francúzsky zástupca:\r\n- Pán Bush, vy ste tak nenormálne hlúpy, alebo ste zhúlený?\r\n- Môžem vás uistiť, že zhúlený nie som.', 261, 3.06, 37),
	(8726, 'Stretne sa v Bagdade Clinton a Sadam Husajn. Ako tak rokujú, stlačí Sadam 1. tlačítko na Clintonovej stoličke. Zrazu vyletí ruka a udrie Clintona do tváre. Ten však nechce pokaziť rokovanie a tak sa tvári, že sa nič nedeje. Husajn stlačí 2. tlačítko a vyletí topánka, ktorá nakope Clintona do zadku. Stále však nechce pokaziť rokovania a tak sa tvári, že sa nič nedeje. Zrazu Husajn stlačí tretie tlačítko a vyletí rukavica, ktorá treskne Clintona rovno do rozkroku. Ten už naštvaný ukončí rokovania, ale dohodnú sa, že sa stretnú vo Washingtone. \r\nRokovanie vo Washingtone. Husajn čaká, čo sa bude diať. Keď Clinton stlačí 1. tlačítko na Husajnovej stoličke, nič sa nestane. Clinton sa začne hrozne smiať. To isté sa stane aj pri stlačení 2. a 3. tlačítka. Keď sa Husajn postaví a oznámi Clintonovi, že ide domov do Bagdadu, Clinton sa len zasmeje: \r\n- Aký domov? Aký Bagdad?', 940, 3.29, 37),
	(8727, 'Viete prečo Chelsie Clintonová nemá súrodencov?\r\nLebo tá sviňa Monika Lewinská jej všetkých požrala!', 110, 3.68, 37),
	(8729, 'Prečo sme najnezávislejšou krajinou v Európe?\r\nLebo od nás už nič nezávisí.', 84, 3.38, 37),
	(8730, 'Premiér na mítingu vraví občanom: \r\n- My chceme len vaše dobro! \r\nObčania: \r\n- Ale my si ho nedáme!', 106, 3.04, 37),
	(8731, 'Vieš ako sa volá Clintonov poklopec?\r\nUS OPEN.', 48, 2.9, 37),
	(8732, 'Kedysi sme bojovali o lepší zajtrajšok, dnes bojujeme medzi sebou o prežitie.', 81, 3.3, 37),
	(8733, 'Aký je rozdiel medzi holubom a policajtom?\r\nŽiadny. Obidvaja všetko poserú a strielať ich nemôžeme.', 106, 3, 37),
	(8734, 'Politik  reční na mítingu a sľubuje všetko, čo mu napadne - štvornásobné platy, zníženie nezamestnanosti na nulu, atď. Keď  skončí prejav, nastanú rôzne reakcie - niektorí pískajú, iní hádžu rajčiny a skazené vajcia,  iba Jožo tlieska ako divý.\r\n„Ty Jožo,  čo tak  nadšene tľapkáš, však si hovoril, že ho neznášaš ??? - pýta sa ho Fero.\r\n„Ale kdeže,  ja tlieskam od radosti, že už konečne prestal tárať  hlúposti!', 463, 2.98, 37),
	(8735, '- Pán minister, môže sa ministrovi povedať, že je vôl? - pýta sa občan.\r\n- To sa teda nepatrí !\r\n- A môže sa volovi povedať, že je pán minister?\r\n- Tak to by sa mohlo, - pripustil minister.\r\n- Tak teda dovidenia, pán minister.', 241, 2.94, 37),
	(8736, '- Čo je to kapitalizmus?\r\n- Je to skutočný raj. 5% ľudí si ho užíva ako Adam a Eva v raji a 95% to potom celý život žehlí u pána Boha strádaním a pokorou.', 168, 3.33, 37),
	(8737, '- Hovorí sa, že obdobie transformácie socializmu na kapitalizmus je dobou rozkvetu.\r\n- Akého rozkvetu?\r\n- U vyšších vrstiev rozkvitá rozkrádanie a korupcia a u nižších bieda.', 186, 3.25, 37),
	(8738, 'Čo je to jašterica?\r\nKrokodíl, čo prežil hospodársky zázrak na Slovensku.', 80, 2.91, 37),
	(8739, '- Viete, že sa včera Boris Jeľcin nervovo zrútil?\r\n- Nečakane  sa mu zlepšil zdravotný stav a niekto mu povedal, že už nie je prezidentom!', 147, 3.1, 37),
	(8740, 'Aký je najnovší americký prostriedok na zaručenie mieru a ľudských práv?\r\nRakety.', 89, 3.08, 37),
	(8741, 'Aký je rozdiel medzi vysokou politikou a vrcholovým futbalom?\r\nFutbal sa hrá podľa pravidiel.', 97, 2.93, 37),
	(8742, '- Predstav si, môj riaditeľ už rok nekompromisne kritizuje nášho ministra, a ten mu na to nepovedal ešte ani slovo.\r\n- To taký sebakritický?\r\n- Nie. On o tom ešte nevie.', 178, 2.72, 37),
	(8744, 'Za ministrom príde návštevníčka. Hovorí sekretárke:\r\n- Idem za ministrom, povedzte mu, že som jeho priateľka zo študentských čias!\r\n- To nemôže byť pravda! Náš minister nechodil do školy.', 205, 3.34, 37),
	(8745, '- Čo to znamená, keď nejaký politik hovorí, že sme všetci na jednej lodi?\r\n- Nuž, chce robiť kapitána a my máme veslovať.', 133, 3.08, 37),
	(8746, 'Povzdychne si dnešný dôchodca:\r\n- To je život! Mladosť mi otrávili rodičia, dospelosť deti a starobu transformácia.', 124, 2.78, 37),
	(8747, '- Karol, vraj si prestal piť!\r\n- Je to pravda.\r\n- A čo ťa k tomu doviedlo?\r\n- To, čo sa deje okolo nás. Vôbec nemám chuť vidieť to dvakrát.', 149, 3.35, 37),
	(8749, 'Terorizmus je choroba, ktorá je spôsobená nedostatkom vitamínu B-52\r\nJa by som aplikoval B-komplex (1, 2 a už spomínanú 52).', 131, 2.89, 37),
	(8750, 'Anketa:\r\n- Čo je hlavný problém dnešného sveta. Nevedomosť alebo flegmatizmus?\r\n- Neviem a je mi to fuk.', 110, 3.44, 37),
	(8751, 'Papaláš sa u lekára sťažoval, že sa nemôže vysrať. Doktor ho prezerá a hovorí:\r\n"Človeče, veď Vy tam nemáte žiadnu dieru!"\r\n"Zalízali mi ju, dočista zalízali!"', 178, 3.17, 37),
	(8752, 'Reakcie slovákov na reformy v zdravotníctve: "No počkaj, zajac!"', 67, 2.64, 37),
	(8753, 'Ďakujem všetkým dobrým, dokonalým a spravodlivým američanom, že sa starajú o právo a poriadok všade na svete. Zároveň by som ich chcel poprosiť, či by nemohli zbombardovať aj susedov barák alebo napalmom mu zrušiť vinohrad. Chodí mi ževraj za ženou a ohrozuje tým bezpečnosť v regióne. Môžem doložiť ľubovolné nejasné fotografické snímky a nahrávky rozhovorov od nás z krčmy, kde jasne počuť niekoľko krát slovo žena, posteľ, vidlák a pod. Myslím, že takéto dôkazy jasne dostačujú na to, aby bol označený ako príčina pre vysokú nezamestnanosť, alkoholizmus, nízke príjmy a výskyt plesne nôh v našom regióne. Vopred ďakujem. Keď ho zrušíte, ešte Mišo mi dĺži 214 korún a kamarát z detstva nejaký Ondro mi ukradol sklenené guličky. Neviem presne ako sa volá, kde býva, ale taký popis by mal stačiť na zatknutie všetkých Ondrov, ktorí sa niekedy dostali do kontaktu so sklenenými guličkami,\r\ntoho pravého predsa nájdete.', 1005, 2.88, 37),
	(8754, 'Ako strašia  malé deti v Iraku?\r\nBu-Bu-Bush.', 46, 3.47, 37),
	(8755, 'Ktoré tri roky boli najťažšie v živote Georga W. Busha?\r\nPrvý ročník na základnej škole.', 98, 3.04, 37),
	(8756, 'Z čoho bol postavený prezidentský palác?\r\nZ mikrobetónu. 50% betón, 50% mikrofóny.', 89, 3.09, 37),
	(8757, 'Počas propagačného turné po USA navštívi prezident George W. Bush istú školu a vysvetľuje žiakom jeho vládnu politiku. Po skončení vyzve žiakov, aby mu položili otázky ak im niečo nie je jasné. Slova sa ujme malý Bob:\r\n- Pán prezident, mám 3 otázky: Ako sa vám podarilo vyhrať voľby, napriek tomu, že pri\r\nspočítavaní hlasov ste prehrali? Prečo chcete napadnúť Irak bezdôvodne? Nemyslíte si, že zhodenie bomby na Hirošimu bol najväčší teroristicky útok v dejinách ľudstva?\r\nV tom zazvoní na prestávku a žiaci sa rozbehnú z triedy von. Po skončení prestávky prezident Bush opätovne vyzve žiakov, aby položili svoje otázky. Tentokrát sa prihlási malý Joe:\r\n- Pán prezident, mám 5 otázok: Ako sa vám podarilo vyhrať voľby, napriek tomu že pri\r\nspočítavaní hlasov ste prehrali? Prečo chcete napadnúť Irak bezdôvodne? Nemyslite si, že zhodenie bomby na Hirošimu bol najväčší teroristicky útok v dejinách ľudstva? Prečo dnes zvonilo na prestávku o 20 minút skôr? Kde je Bob?', 1052, 3.68, 37),
	(8758, '21. augusta 1968 vraví žena mužovi:\r\n"Vstávaj, starý, sme obsadení!"\r\n"Ale veď to by Rusi nedovolili."', 109, 3.24, 37),
	(8759, 'Horár príde na lesnú čistinku a vidí zo zeme trčať hlavu.\r\n"A ty si kto?" prihovorí sa jej.\r\n"Ja som prosím zarytý komunista." odpovie hlava.', 151, 3.07, 37),
	(8760, 'Vysielanie rozhlasu:\r\nJe 6:00 - Pán premiér vstáva, vstávame aj my.\r\nJe 6:15 - Pán premiér si ide zacvičiť, zacvičíme si aj my.\r\nJe 6:30 - Pán premiér sa ide umyť, poumývame sa aj my.\r\nJe 6:45 - Pán premiér sa ide naraňajkovať a my si zatiaľ vypočujeme pár pekných pesničiek.', 298, 2.97, 37),
	(8761, 'Na plot pred úradom vlády vyliezol chlap.\r\n- Zlezte dolu! - volá naňho policajt.\r\n- Nejdem! Som slobodný občan demokratického štátu!\r\n- Prepáčte, nevedel som, že ráčite byť cudzinec.', 197, 2.99, 37),
	(8762, 'Jakeš, Husák a Kapek sa stretnú po dlhom čase a dohodnú sa, že pôjdu medzi ľudí, či ich ešte niekto spozná. Prvý ide Jakeš, vráti sa a hovorí:\r\n- Nepoznali ma.\r\nPotom ide Husák a dopadne takisto. Ide nakoniec Kapek a po čase sa smutný vráti s tým, že ho spoznali. \r\n- Ako je to možné? - čudujú sa Jakeš a Husák.\r\n- No viete, bol som na verejných záchodoch, prišiel ku mne taky starší pán a povedal: "Kapku uhni, nebo te oštím!".  ', 466, 3.17, 37),
	(8763, 'Zasmejme sa s poslancami:\r\n- Viac hláv, viac rozumu.\r\n- Bez práce nie sú koláče.\r\n- Kto do teba kameňom, ty do neho chlebom.', 130, 3.31, 37),
	(8764, 'Prečo sa v parlamente nehrajú na schovávačku? \r\nLebo vedia, že by ich nikto nehľadal.', 91, 3.1, 37),
	(8765, 'Viete, čo chýba politikom k dokonalosti?\r\nTlačidlo "OFF".\n', 61, 3, 37),
	(8766, 'Prečo majú politici záujem o privatizáciu Dunaja?\r\nLebo má najväčšie koryto.              ', 98, 3, 37),
	(8767, 'Stretne radový politik čarovnú babičku a ona sa ho pýta:\r\n"Tak čo, čím by si chcel byť po voľbách?"\r\nPolitik:\r\n"Ministrom!"\r\nBabka šibne čarovným prútikom a z radového politika je bonsaj...              ', 219, 4.15, 37),
	(8768, 'Viete, aký je rozdiel medzi ministrom financií a jednorazovými plienkami?\r\nŽiadny. Ani z jedného nič nevyžmýkate!              ', 135, 3, 37),
	(8769, 'REFERENDUM:\r\nNezabudnite si v sobotu splniť svoju občiansku povinnosť - zavrieť starých rodičov do pivnice.              ', 127, 3.14, 37),
	(8770, 'Čo je to kapitalizmus?\r\nJe to skutočný raj. 5% ľudí si ho užíva ako Adam\r\na Eva v raji a 95% to potom celý život žehlí u pána Boha strádaním a pokorou.              ', 179, 3.5, 37),
	(8771, 'Reakcie Slovákov na reformy v zdravotníctve:\r\n"No počkaj, zajac!"\n', 69, 2.92, 37),
	(8772, 'Príde svalnáč v kukle a so samopalom do parlamentu a kričí:\r\n"Ktorý je tu Vlado?"\r\nVšetky ruky jednoznačne ukazujú na jedného muža. Potom kukláč hovorí:\r\n"Vlado ľahni!"\r\n...ratatata...              ', 213, 3.62, 37),
	(8773, 'Stretnú sa český a americký minister financií:\r\nAmerický vraví: \r\n"U nás si ľudia zarábajú asi tak 3 tisíc, 2 tisíc zaplatia za dane a ostatné poplatky. A čo robia s tým tisícom, to je mi úplne fuk!"\r\nČeský minister financií vraví: \r\n"U nás je to skoro rovnaké. U nás si ľudia zarábajú asi 10 tisíc, 13 tisíc zaplatia za dane a ďalšie poplatky. A kde zoberú tie 3 tisícky, to je mi fuk!"              ', 435, 4.06, 37),
	(8774, 'Brežnev príde k nebeskej bráne a Svätý Peter sa ho pýta:\r\n"Tak čo, Brežnev, chceš byť vo východnom sektore alebo v západnom?"\r\n"No, ako sa ma na toto vôbec môžeš pýtať, ja uvedomelý komunista, generálny tajomník ÚV, no teda  samozrejme, že do východného!"\r\n"No dobre, dobre - ale to ti hovorím: Na raňajky, obedy a večere budeš chodiť do západného!" Brežnev sa diví.\r\nSvätý Peter: "No predsa nebudeme kvôli jednému variť vo východnom!"\n', 476, 4.07, 37),
	(8775, 'Čo sa stane, keď sa utopí sociálny demokrat?\r\nNajskôr vyplávajú špinavé peniaze a potom čistý komunista.              ', 129, 3.67, 37),
	(8776, 'Po železnici ide rušeň a rušňovodič vidí, ako sa po trati prechádzajú Húska s Cuperom. Rušňovodič preto na nich zakričí:\r\n"Neprechádzajte sa tu po trati". \r\nUdivení inteligenti na to vykríknu: \r\n"My nie sme nijakí potrati."              ', 256, 3.75, 37),
	(8777, 'Pred snemom KDH šepká príslušník SIS svojmu kolegovi:\r\n"Počul si, v parlamente našli dve bomby!"\r\n"Pssst, až zajtra..."              ', 141, 3.5, 37),
	(8778, 'Prebudí sa zmrazený Husák po sto rokoch, ide po ulici a pýta sa: \r\n"Chlapček, prosím ťa, kde je tu KSČ?" "KSČ? To nepoznám." \r\n"Pane, prosím vás, kde je tu KSČ?" "KSČ? To nepoznám." Nakoniec: "Deduško, prosím vás, kde je tu KSČ?" Dedo odpovedá: \r\n"KSČ, joj vy myslíte komunistov, to musíte do hôr, ale to si nezastrieľate, oni sú chránení!"              ', 382, 3.5, 37),
	(8779, 'Čo je to policajný obušok?\r\nElastický doplnok ústavy.              ', 72, 2.6, 37),
	(8780, 'Aký je rozdiel medzi vysokou politikou \r\na vrcholovým futbalom?\r\nFutbal sa hrá podľa pravidiel.              ', 113, 3.4, 37),
	(8781, 'Hovorí sa, že obdobie transformácie socializmu na kapitalizmus je dobou rozkvetu.\r\nAkého rozkvetu?\r\nU vyšších vrstiev rozkvitá rozkrádanie \r\na korupcia a u nižších bieda.              ', 196, 2.6, 37),
	(8782, 'Čo je to kapitalizmus?\r\nJe to skutočný raj. 5% ľudí si ho užíva ako Adam a Eva v raji a 95% to potom celý život žehlí u pána Boha strádaním a pokorou.              ', 178, 2.83, 37),
	(8783, 'Politik reční na mítingu a sľubuje všetko, čo mu napadne - štvornásobné platy, zníženie nezamestnanosti na nulu, atď. Keď skončí prejav, nastanú rôzne reakcie - niektorí pískajú, iní hádžu rajčiny a skazené vajcia, iba Jožo tlieska ako divý.\r\n"Ty Jožo, čo tak nadšene tľapkáš, však si hovoril, že ho neznášaš ???"pýta sa ho Fero.\r\n"Ale kdeže, ja tlieskam od radosti, že už konečne prestal tárať hlúposti!"              ', 465, 3, 37),
	(8784, '"Pán minister, môže sa ministrovi povedať, že je vôl?" - pýta sa občan.\n"To sa teda nepatrí!"\n"A môže sa volovi povedať, že je pán minister?"\n"Tak to by sa mohlo," - pripustil minister.\n"Tak teda dovidenia, pán minister."              ', 250, 3.67, 37),
	(8785, 'Do budovy slovenského parlamentu sa silou mocou dobýja nejký muž.\n- Máte preukaz? - pýta sa služba.\n- Nie.\n- Tak čo tu potom chcete?\n- Zmlatiť ministra...\n- Tak sa rýchlo ponáhľajte, kým nezačne rokovanie!              ', 233, 3.14, 37),
	(8786, '”A ja tvrdím,” vraví Jožo v krčme kamarátom, \r\n” že prvým ekonómom na svete bol Kolumbus.”\r\n”A to už prečo?” spytujú sa ho kamoši.\r\n”No po prvé: nevedel kam ide, po druhé: nevedel, kam prišiel \r\na po tretie: celý ten jeho podnik financovala vláda.”              ', 295, 3.17, 37),
	(8787, 'Stalin sa prechádzal po dedine a uvidel pri potoku ženy.\r\n”Čo robíte, súdružky?”\r\n”Perieme prádlo!”\r\nStalin sa usmial a vraví:\r\n”Len perte, perte, zajtra sa bude vešať.”\n', 192, 3.86, 37),
	(8788, 'Lupič prepadne ministerského predsedu a zreve:\r\n”Daj mi všetky svoje peniaze!!!”\r\n”No dovoľte! Viete, kto som ja!? Ja som predseda vlády Slovenskej republiky!”\r\n”Daj mi všetky moje peniaze!!!” zreve na to lupič.              ', 244, 4.15, 37),
	(8789, 'Príde politik k zubárovi a sťažuje sa:\r\n”Pán doktor, mám tu vľavo hore zubný kaz, dajte mi to do poriadku.”\r\n”Sadnite si tu do kresla, odvŕtam vám to.”\r\nPolitik si sadne, lekár vŕta a on si sťažuje:\r\n”Juj, pán doktor, to ale bolí!”\r\n”Pane,” zazrie na neho nehnevane lekár, ”je všeobecne známe, že bolesť je vyhodnocovaná mozgom. Tak mi tu nesimulujte!”              ', 408, 4.17, 37),
	(8790, 'Idú dvaja politici a jedného zrazí auto a druhý povie: "zo zrazeným politikom sa nerozprávam!"              ', 114, 2.47, 37),
	(8791, 'Stojí poslankyňa pred zrkadlom, s úľubou sa obzerá a pýta sa:\r\n”Zrkadlo, zrkadielko, povedz že mi, kto je najkrajší na tejto zemi?!\r\n”No predsa Snehulienka! Ty koza!” odvetí zázračné zrkadlo.              ', 224, 2.77, 37),
	(8792, '”Aký je rozdiel medzi našou vládou a obilím?”\r\n”Žiadny. Oboje sa musí vymlátiť, inak pomrieme od hladu.”              ', 134, 3.78, 37),
	(8793, '”Súdruh Stalin, aké máte hobby?”\r\n”Zbieram vtipy o mne.”\r\n”A koľko ich už máte?”\r\n”Asi tak dva a pol gulagu.”               ', 146, 3.5, 37),
	(8794, '”Zrkadielko, zrkadlo, povedz že mi, kde je stabilita ekonomiky?” pýta sa premiér zázračného zrkadla.\r\n”Otoč sa,” hovorí zrkadlo, ”a ja ťa do nej riadne kopnem!”              ', 195, 4.2, 37),
	(8795, 'Malý chlapec sa pýta okoloidúceho premiéra:\r\n”Ujo, prosím vás, koľko je hodín?”\r\nPremiér mu odpovedá:\r\n”Som nesmierne šťastný, že mi kladieš takúto otázku a ver mi, že k nej pristupujem maximálne zodpovedne, ale musím ťa zároveň informovať, že na ňu odpoviem v pravý čas len a len kompetentným orgánom.”	              ', 356, 4.22, 37),
	(8796, '”Predstavte si, že v detstve som túžil stať sa zbojníkom.” rozpráva poslanec v spoločnosti.\r\n”Vy máte ale šťastie!” poznamenal ktosi. ”Málokomu sa detské sny splnia...”              ', 206, 4, 37),
	(8797, 'Jožo vraví Mišovi:\r\n”Poznáš tento vtip, že švihá si to premiér na bicykli z kopca a zrazu spadne...”\r\n”Nie, nepoznám, ale začiatok to má pekný...”              ', 181, 3.75, 37),
	(8798, 'Viete, prečo sa slovenský politik najlepšie cíti na hajzli?\r\n-Lebo len tam dokáže vyjadriť svoj vzťah k národu. \n', 122, 3.75, 37),
	(8799, 'Ako sa začína privatizačná rozprávka?\r\nKde bolo, tam nebude...              ', 81, 4.17, 37),
	(8800, 'Horár príde na lesnú čistinku a vidí zo zeme trčať hlavu.\r\n”A ty si kto?” prihovorí sa jej.\r\n”Ja som prosím zarytý komunista.” odpovie hlava.              ', 173, 3.86, 37),
	(8801, 'Predseda vlády vraví na zasadnutí:\r\n”Musíme nájsť nejaký razantný spôsob ako sa dostať z tohto všeobecného svrabu. Ja som predsa ľuďom sľúbil dvojnásobné platy! Má niekto nejaký návrh?”\r\nMinister financií:\r\n”Navrhujem vyhlásiť vojnu Spojeným štátom severoamerickým. V priebehu jedného dňa nás porazia, nastolia okupačnú správu, vyhlásia nový Marshallov plán... a sme z toho vonku.”\r\nPredseda vlády:\r\n”No áno...  to by šlo... Ale čo keď vyhráme?”              ', 514, 3.75, 37),
	(8802, 'V rámci predvolebnej kampane sa premiér zastaví pri krčme a prihovorí sa chlapom postávajúcim pred krčmou:\r\n„Tak chlapi, čo teraz robíte?”\r\n„Čakáme na dvojnásobné platy!” jeden žartovne odpovie.\r\n„Ale to je naozaj skvelé, veď vy ste si našli trvalé zamestnanie!”              ', 307, 3.5, 37),
	(8803, 'Ako sa povie peniazom, ktoré pretelefonovala manželka prezidenta?\r\nŽe boli prešustrované.              ', 108, 1.92, 37),
	(8804, 'Na hodine gramatiky.\r\n”Móricko, povedz množné číslo slova „podvodník”!”\r\n”Vládna koalícia.”              ', 125, 4, 37),
	(8805, 'Viete kedy bude na Slovensku pokoj?\r\nKeď Dzurindova vdova prinesie na Šusterov pohreb správu, že na Mečiarovom pohrebe zabili Bugára.              ', 153, 4.03, 37),
	(8806, 'Premiér vraví na zasadnutí:\r\n”Milí kolegovia, musím vám konečne povedať pravdu. S našou ekonomikou a s celým Slovenskom vôbec, to vyzerá úplne katastrofálne.”\r\n”Pán premiér, zase všetko prikrášľujete!”              ', 243, 3.94, 37),
	(8807, 'Premiér telefonoval prezidentovi. Ten zdvihol slúchadlo a ozval sa slovami:\r\n“Prosím, tu najlepší slovenský politik.”\r\nPremiér udivene vraví:\r\n“Prepáčte, asi som omylom vytočil vlastné číslo.”              ', 228, 3.75, 37),
	(8808, '“Ako sa máte?” žartuje premiér.\r\n“Dobre, dobre.” žartujú občania.              ', 93, 4.17, 37),
	(8809, 'Piroška! Dávaj pozor! Tu si v škole a nie v parlamente!              ', 72, 4, 37),
	(8810, 'Príde pán Novák na ministerstvo a pýta sa vrátnika:\r\n”To ministerstvo je veľké, však?”\r\n”Áno, to je.”\r\n”A koľko ľudí tu pracuje?”\r\n”Hm, povedal by som, že necelá polovica.”              ', 216, 3.97, 37),
	(8811, 'Ako sa tak občas v telke pozerám na nášho ministerského predsedu prichádzajú mi na um\r\ndve otázky:\r\nPrvá:\r\n”Kam odišiel cirkus?”\r\nDruhá:\r\n”Prečo práve jeho nechali tu?”              ', 203, 4.06, 37),
	(8812, 'Novinár robí rozhovor s manželkou premiéra a pýta sa jej:\r\n”Pani Premierová, ako vás ”zbalil” váš manžel?”\r\n”Nachytal ma na sľuby.”              ', 168, 3.44, 37),
	(8813, 'Premiér príde domov a hovorí:\r\n”Drahá, dnes nám predseda parlamentu povedal, že odteraz budeme platení len od vykonanej práce.”\r\nPani Premiérová zalomí rukami a hovorí:\r\n”Preboha, z čoho budeme potom žiť?”              ', 242, 3.86, 37),
	(8814, '“Veď my chceme len vaše dobro!” vyhlásil Premiér na stretnutí s občanmi.\r\n“Ale my si ho nedáme!” Kričali občania.              ', 144, 3.75, 37),
	(8815, '-Pani ministerka, zdedil som 1.000.000 dolárov. Do ktorej banky si ich mám uložiť, ktorá je najbezpečnejšia?\r\n-To je jedno, už sú všetky bezpečné.\r\n-Vážená pani, povedal som, že som dedil, nie, že som debil.\n', 225, 4, 37),
	(8816, 'Prezident USA volá do Kremlu a pýta sa na výšku priemerného platu. Minútu nikto neodpovedá a potom sa ozve zúfalý hlas:\r\n"A vy zasa diskriminujete černochov!"\n', 169, 3.4, 37),
	(8817, 'Prečo nemôže byť prdel v KSČ?\r\n1) Je vnútorne rozvrátená\r\n2) Má dve tváre\r\n3) Na všetko serie\r\n4) Do styku so straníckou tlačou prichádza len pod nátlakom pravice\n', 178, 2.4, 37),
	(8818, '- Viete, prečo sa toaletný papier skladá z dvoch vrstiev?\r\n-  Lebo kópiu treba odovzdať na daňový úrad.\n', 112, 2.75, 37),
	(8819, '- Ten proces integrácie do NATO mi pripomína základnú vojenskú službu.\r\n- Prečo?\r\n- Prebieha to ako na vojenčine: Plazením sa po bruchu a prískokmi vpred!\n', 165, 3.44, 37),
	(8820, 'Brežnev sa chváli:\r\n"Mám nového koníčka, zbieram politické vtipy o sebe."\r\n"A koľko ich už máte?"\r\n"Zatiaľ len dva a pol gulagu."\n', 141, 2.75, 37),
	(8821, 'Zastaví auto  s Jakešom  pred domom, kde sedí babička. Z auta vystúpi šofér a vraví:\r\n"Babka, pustite s. Jakeša k Vám na záchod."\r\n"Nepustím, nech ide do kríku!"\r\n"Ale babka, to je predsa súdruh Jakeš, nemôže ísť do kríku.\r\nNie, ja ho pustím, vyští sa tu a potom mi z toho urobia sieň tradícií a ja budem chodiť do kríku!"\n', 351, 2.33, 37),
	(8822, 'Stratil sa Brežnev v lese a išli ho hľadať. Pýtajú sa líšky.\r\n"Nie, nikoho som nevidela, ale spýtajte sa medveďa. On teraz maródi, už týždeň serie medaile."\n', 172, 3.43, 37),
	(8823, 'Najlepší politický vtip je ten, na ktorý si ešte po desiatich rokoch spomeniete a tak sa mu smejete, že až za mreže popadáte.\n', 135, 2.8, 37),
	(8824, 'V komunizme nebudú v spálňach postele. \r\n1. Športovci budú spať na vavrínoch.\r\n2. Umelci budú mať na ružiach ustlaté.\r\n3. Komunisti budú bdieť.\r\n4. Ostatní budú sedieť.\n', 185, 3.65, 37),
	(8825, 'Kedysi dávno vraj Rusi navrhli Reagana na kandidáta na Leninov rád. Dozvedeli sa totiž, že na každom Pershingu je veľký červený nápis:\r\n"Komunizmus - náš cieľ!"\n', 175, 3.69, 37),
	(8826, 'Pred voľbami sa stretne Reagan s Husákom.\r\n"Asi pätnásť miliónov voličov bude proti mne," vraví Reagan.\r\n"Ale aj tak ma zvolia."\r\n"Rovnako ako u nás!" zvolá Husák.\n', 175, 4, 37),
	(8827, 'Po dlhej dobe sa stretnú dvaja kamaráti:\r\n"Kde si bol tak dlho?"\r\n"Pätnásť rokov som bol zavretý."\r\n"Za čo?"\r\n"Za nič."\r\n"Neklam, to bolo na desať!"\n', 158, 3.25, 37),
	(8828, 'Raz sa Brežnev na konferencii zamyslí:\r\n"Teda poviem vám, časové zóny, to je problém. Idem z obeda a vravím si: Zavoláš Reaganovi a urovnáš s ním tie rakety. \r\nLenže v USA bola ešte noc, tak bol tak nasratý, že z toho zišlo. No alebo zavolám Pápežovi, že ako sa mu darí po tom atentáte. No a ono bolo hodinu pred ním."\n', 344, 4.09, 37),
	(8829, 'Lenin sa na smrteľnej posteli rozpráva so Stalinom:\r\n"Obávam sa jednej veci. Súdruh Stalin, myslíš, že ťa budú ľudia nasledovať?"\r\n"Áno, myslím, že určite budú."\r\n"Tiež dúfam, ale čo keď nebudú?"\r\n"Nie je problém. Budú nasledovať teba."\n', 261, 4.21, 37),
	(8830, 'Viete, aký je rozdiel medzi súčasným zriadením a tým, čo bol pred rokom 89?\r\nVtedy to brali politici vážne a ľudia si z nich robili srandu. Teraz je to naopak.\n', 170, 3.62, 37),
	(8831, 'Pred odvodovú komisiu príde branec, ktorému sa na vojnu nechce:\r\n"Ja mám tuberu!"\r\n"Aj Zápotocký ju mal a čo dokázal! Odviesť!"\r\nDruhý branec:\r\n"Mám ploché nohy!"\r\n"Gottwald mal tiež ploché nohy, a čo dokázal! Odviesť!"\r\nTretí mladík pred komisiou hovorí:\r\n"Ja som blbý!"\r\nVojenský lekár povie:\r\n"Neporovnávať! Odviesť!"\n', 347, 3.93, 37),
	(8832, 'Ako dlho trvá cesta okolo sveta?\r\nDvadsať tri rokov. Roku 1945 sme okupantov vyhnali na západ a roku 1968 prišli z východu.\n', 129, 3.22, 37),
	(8833, 'Traja sa hádajú, kto má lacnejšiu výrobu zbraní. Američan:\r\n"My vieme vyrobiť tank za 2000 dolárov."\r\nNemec:\r\n"Náš tank stojí len 2000 mariek."\r\nČechoslovák:\r\n"A nám stačí povedať 2000 slov, a máme tankov plnú republiku."\n', 242, 3.85, 37),
	(8834, '21. augusta 1968 budí žena muža:\r\n"Vstávaj, sme obsadení!"\r\n"Ale to by predsa Rusi nedovolili..."\n', 103, 3.86, 37),
	(8835, 'Stretne sa Husák s Brežnevom:\r\n"Gusto, ako ste na tom s obilím"\r\n"Prekročili sme plán o 8 percent."\r\n"Výborne, tak pošlete do Rumunska 50 vagónov. A čo zemiaky?"\r\n"Tiež prekročený plán."\r\n"Dobré, Poliakom dáte 100 vagónov. A čo huby?"\r\n"Ej, veľká bieda,"\r\n"Neboj sa, hneď zajtra Ti posielam 100 000 kozákov aj s rodinami."\n', 344, 3.91, 37),
	(8836, 'Horár príde na lúku a vidí zo zeme trčať hlavu.\r\n"A ty si kto?" pýta sa.\r\n"Ja som, zarytý komunista."\n', 110, 3.33, 37),
	(8837, 'Aký je vzťah medzi prácou a mzdou v socializme?\r\nPracujúci predstierajú, že pracujú, a štát predstiera, že ich za to platí.\n', 135, 3.82, 37),
	(8838, 'Môžete definovať kto je komunista a kto antikomunista?\r\nIste. Komunista je ten, kto čítal diela Marxa a Lenina. Antikomunista je ten, kto im porozumel.\n', 157, 4.27, 37),
	(8839, 'Je pravda, že sa budú zvyšovať mzdy?\r\nÁno, ale podľa abecedného poriadku: (A) armáda, (B) byrokracia, (C) cenzori, (D) dosť.\n', 134, 2.89, 37),
	(8840, 'Vieš aký je rozdiel medzi socializmom a dnešným kapitalizmom na Slovensku?\r\nZa socializmu sa kradla z fabriky solvina a dnes sa kradne celá fabrika.              ', 167, 3.33, 37),
	(8841, 'Využi svoje občianske právo a zamkni babku s dedkom počas volieb do pivnice.              ', 94, 3.87, 37),
	(8842, 'Príde svalovec v kukle a so samopalom do parlamentu a kričí:\r\n- Ktorý je tu Vlado?\r\nVšetky ruky jednoznačne ukazujú na jedného muža. Potom kukláč hovorí:\r\n- Vlado, ľahni!  ...ratatatatatatata...               ', 222, 4, 37),
	(8843, 'Opitý chlap leží nad kanálom, lomcuje mrežami a hľadiac kamsi dovnútra zúfalo volá:\r\n- Súdruhovia, prečo?\n', 117, 4.08, 37),
	(8844, 'Rusi poslali po Nagane Čechom telegram:\r\n- ste dobrý hokejový tím STOP\r\n- boli ste rovnocenným súperom STOP\r\n- gratulujeme STOP\r\n- ropa STOP\r\n- zemný plyn STOP              ', 180, 3.98, 37),
	(8845, 'Politické výklepky:\r\nKedysi som býval veľmi namyslený, ale teraz som už celkom bez chyby!              ', 109, 4.07, 37),
	(8846, 'Brežnev dal postaviť budovu amerického konzulátu v Moskve z mikrobetónu. 50% mikrofónov a 50% betónu.\n', 109, 4, 37),
	(8847, 'Rozprávajú sa dvaja priatelia:\r\n- V politike je dôležitá slovná zásoba. \r\n- A to už prečo?\r\n- Aby mohol politik opakovať často to isté, a pritom použil slová, ktoré sa budú ľuďom páčiť.              ', 220, 3.8, 37),
	(8848, 'Otázka na Rádio Jerevan:\r\n”Čo znamená nastolenie vlády zákona v kapitalizme?”\r\nOdpoveď:\r\n”Keď veľkí zbojníci začnú zatvárať malých zbojníkov.”              ', 181, 3.6, 37),
	(8849, 'Dežo volá do parlamentu:\r\n”Haló, počul som, že tam máte voľné miesto.”\r\n”Čo ste sa zbláznili?”\r\n”To nie, ale ak je to podmienkou, tak môžem.”              ', 179, 4, 37),
	(8850, 'Sedí poslanec v parlamente a podopiera si rukou hlavu. Vedľa sediaci poslanec sa ho po chvíli pýta:\r\n”Tak čo, kolega, sedíš a rozmýšľaš?”\r\n”Nie, iba sedím.”              ', 190, 4, 37),
	(8851, 'Rok 1948. Československá ľudovo-demokratická republika. \r\nPríde babka na povereníctvo a zdraví povereníka:\r\n- Na stráž!\r\n- Babka, splietli ste si dobu. Už nemáme takzvaný Slovenský štát.\r\n- Dobu som si možno splietla, - odvetí babka -  ale teba nie!\n', 268, 4.23, 37),
	(8852, 'Slovenský štátny úradník, aby sa tváril, že niečo robí, utiera prach na stole a na lampe. Zrazu sa zjaví veľký džin a hovorí, že mu splní tri želania.\r\n- Chcel by som veľké studené pivo.\r\nSplní sa a na stole je perlivý mok. Teraz sa už viac zamyslí a povie:\r\n- Chcel by som byť bohatý na tropickom ostrove a okolo seba mať desať sexbômb.\r\nSplní sa. Okolo neho tancujú krásky hore bez. On neváha a do tretice povie:\r\n- Tak a teraz si želám, aby som už vôbec nemusel pracovať.\r\nSplní sa a slovenský úradník sa opäť ocitne vo svojej kancelárii.               ', 601, 4.11, 37),
	(8853, 'Ide smrtka po parlamente,príde do kancelárie k Ficovi,a hovorí mu. No Robko tebe dávam ešte pät rokov života. Ide ďalej a príde do kancelárie k Mečiarovi. Vladko ty si moja krvná skupina, tak si ži koľko len budeš chcieť. Toto všetko počul Béla Bugár a rýchlo bežal do svojej kancelárie, vyzliekol sa donaha a sadol si na nočník. Prišla smrtka za ním a pýta sa Béla čo robíš? Kakám! Tak dokakaj a pôjdeme PA PA!', 445, 3.83, 37),
	(8854, 'V Albánsku boli voľby. Každému voličovi dali do ruky zalepenú obálku. Potom ich vyzvali, aby ju hodili do urny. Akýsi pastier cestou k urne začal onálku otvárať. Volebný orgán ho okríkol:\r\n-Čo to robíš?\r\n-Chcem iba vedieť, čo tam stojí napísané.\r\n-A či ty nevieš, že naše voľby sú tajné?!', 318, 3.73, 37),
	(8855, 'Príde Fico, Mečiar a Slota do škôlky a pýtajú sa dievčatka: "Ako sa voláš?""Anetka.""A vieš aj nejakú básničku?""Áno, ťapi ťapi ťapušky zdraželi nám papučky. A ockovi alkohol, ktorí debil z vás to bol?"', 225, 4, 37),
	(8856, 'Jedného dňa dostal Bush infarkt a umrel. Okamžite sa odobral do pekla, kde ho už čakali.\r\n"Si na mojom zozname," povedal mu diabol, " ale ja práve nemám voľné miesto. V každom prípade tu, ale musíš zostať, takže mám pre teba návrh. Mám tu pár hriešnikov, ktorí neboli takí zlí ako ty. Jedného z nich pustím, ale ty pôjdeš na jeho miesto. A budem k tebe dokonca, tak dobrý, že ti dovolím, aby si si sám vybral."\r\nBushovi sa to zdalo ako dobrý obchod. Diabol teda otvoril prvú miestnosť. Tam bol veľký bazén a v ňom plával Nixon. Stále sa potápal a niečo hľadal, ale vždy sa vynoril s prázdnymi rukami. Znovu a znovu.\r\n"Nie," povedal Bush. "Já nie som dobrý plavec. Myslím, že toto by som nemohol robiť."\r\nDiabol teda otvoril druhú miestnosť. Tam bol Newt Gingrich a veľkým kladivom rozbíjal kamene. Kameňov nikdy neubúdalo. "Nie" povedal Bush. "Mám problémy s ramenom. Strašne by som trpel, keby som musel stále rozbíjať kamene."\r\nDiabol teda otvoril tretiu miestnosť. Tam ležal na zemi Bill Clinton, ruky zviazané nad hlavou, nohy zviazané a roztiahnuté. Nad ním sa skláňala Monica Lewinská a robila to, čo vedela najlepšie. Bush bol v šoku. Potom povedal: "Hej, myslím, že toto by som vydržal."\r\nDiabol sa zasmial a povedal: "Monika, môžeš ísť."', 1329, 4.28, 37),
	(8857, 'V lietadle sa bavia politici o ťažkej finančnej situácii nás dole.\rFico hovorí: "Otvorím okno a vyhodím 10 tisíciek, nech má aspoň 10 ľudí radosť!"\rPočiatek horoví: "Otvorím okno a vyhodím 20  päťstokorunáčiek, nech má aspoň 20 ľudí radosť!"\rPilot sa na nich otočí a hovorí: "Vy debili, ja vás vyhodím obidvoch, nech majú radosť všetci!"\r', 373, 4.25, 37),
	(8858, 'Mimoriadne správy: Nehoľte si chlpy a nechajte si narásť kožuch.... Plyn nebude!!! ', 88, 3.55, 37),
	(8859, 'Pýta sa učiteľka v škole žiakov ako máju radi nášho premiéra.Prve hovorí dievčatko: "Ja si ho dám vytetovať na prsia, a keď mi budú rásť bude s nimi rásť aj Fico."\r\nDruhe hovorí dievčatko: "Ja si ho dám vytetovať na bruško, a keď budem tehotná, tak bude rásť spoločne s mojím dieťatkom."\r\nA tretí hovorí chlapček: "Ja si ho dám vytetovať na penis, a buď pôjde do pi.. alebo bude vysieť.\r\n', 427, 4.12, 37),
	(8860, 'Viete aký je rozdiel medzi šampónom a Dzurindom?Žiadny, obidva sú na hlavu.', 80, 2.63, 37),
	(8861, 'Recepcia v Bielom Dome. Bush sa rozpráva spolu s Blairom a potmehúdsky sa usmievajú. V tom ich spozoruje jeden pán, nedá mu to, pristaví sa pri nich a hovorí:"Páni ako vás tak pozorujem, tak vidím, že sa dobre bavíte. Chcel by som vedieť na čom."\r\nBush mu odpovedá:"Rozprávame sa o tretej svetovej vojne."\r\n"Hmm, to znie zaujímavo" - odpovedá muž."A ako si to predstavujete?"\r\nBush:"Zabijeme 80 mil. moslimov a jedného zubára."\r\nMuž:"Páni, a prečo zabijete toho zubára."\r\nV tom sa Blair nakloní k Bushovi, a hovorí mu:"Vidíš, hovoril som ti, nikto sa nebude pýtať, prečo 80 mil. moslimov."\r\n', 623, 4.28, 37),
	(8862, 'Kamión smeruje do Bratislavy. Zastaví ho policajná hliadka a zistí, že šofér nezaplatil cestné mýto. Po kontrole policajt udelí blokovú pokutu.\r\nVodič pri odchode vulgárne vynadá policajtovi.\r\nPrípad sa dostane pred súd.\r\nPodľa rozsudku, šofér musí zaplatiť pokutu 5 550 eur.\r\n50 eur lebo nezaplatil zvýšené mýto.\r\n500 lebo urazil príslušníka policajného zboru.\r\nA 5000 preto lebo to urobil po maďarsky.', 433, 4.06, 37),
	(8863, 'Aký je rozdiel medzi Ivetou Radičovou a Napoleonom Bonaparte???\r\n- Pod jeho nenápadným zovňajškom sa skrývala povaha plná silných emócií a agresivity.\r\n- Hoci vedel byť arogantný a panovačný, bol to energický človek činu a mal víziu budúcnosti.(len svojej).\r\n- 2. decembra 1804  sa v Notre Dame de Paris Napoleon nechal korunovať za cisára. Napoleon Bonaparte počas obradu vytrhol korunu z rúk pápeža Pia VII.\r\n- Bol chodiaca smršť.\r\n- Keď dosiahol moc, spyšnel a zlenivel.\r\n- Napolenon nenosil sukňu a Radičova ju nosí ....\r\n', 559, 3, 37),
	(8864, 'Boh stvoril vrany a  čert politické strany.', 45, 3.38, 37),
	(8865, 'Jeden chlapík hovorí druhému:\rPočuj, choď dakedy do tej novej krčmy, majú tam barmana-robota.\rChlapík príde a robot sa ho pýta, aké má IQ.\rOdpovie, že okolo 150. Dostane výborné pivo, a robot sa s ním začne baviť o fyzike, vesmíre, globálnom oteplovaní atď.\rOn samozrejme ničomu nerozumie.\rĎalší deň príde znova, ale povie, že má IQ okolo 100.\rRobot sa s ním začne baviť o autách, športe a ženách, pričom znova dostane skvelé pivo.\rNa tretí deň príde a povie, že má IQ okolo 50.\rRobot potom povie: Tak čo? Najbliššie znova volíme Fica? ', 584, 2.85, 37),
	(8866, '- Kedy si prestal veriť na Mikuláša???\r\n- Keď SDKU zvýšila daň za pivo...', 80, 3.88, 37),
	(8867, 'Modlitba k bohu:\r\nPane Bože, tento rok si mi vzal môjho obľúbeného speváka Michaela Jacksona,\r\ntento rok si mi zobral aj môjho obľúbeného herca Patrika Swayzeho,\r\na tento rok si mi dokonca zobral aj môjho oľúbeného člena skupiny Boys on.\r\nA povedal som ti už Pane Bože, že môj obľúbený politik je Fico?', 324, 4.11, 37),
	(8868, 'Ide Obama po ulici a stretne bezdomovca ako si natiera chleba hovnom a hovorí mu: "Čo to robíš, na tu máš 500 dolárov a choď sa niekam najesť."\r\nO niečo neskôr ide Medveďev a stretne toho istého bezdomovca ako si natiera  chleba hovnom a hovor muí: "Čo to robíš, na tu máš 1000 rubľov a bež sa poriadne najesť."\r\nPotom ide Radičová a stretne tiež bezdomovca ako si natiera chleba hovnom a hovorí mu: "Čo to robíš, nie tak nahrubo! Aj zajtra je deň.."', 480, 4.28, 37),
	(8869, 'OSN sa pýta Busha:\r- A odkiaľ viete, že Hussajn má všetky tie zbrane, ktoré tvrdíte, že má?\rBush sa usmeje a odpovedá:\r- Ešte stále mám odložené dodacie listy!', 174, 3.82, 37),
	(8870, 'Oznam slovenskej pošty:\r\nOd júna sťahujeme z obehu známky s tvárami politikov. \r\nDôvod: Národ nevie, ktorú stranu má opľuť.', 134, 4.26, 37),
	(8871, 'Viete aký je rozdiel medzi WC a naším parlamentom?\r\nŽiadny. Obidve sú na prd.', 82, 4.18, 37),
	(8872, 'Vymením poslancov parlamentu za vlečku hnoja. Značka: Hovno za hovno.', 72, 4.21, 37),
	(8873, 'Viete preč padla vláda?\r\nLebo je grécky týždeň v Lidli.', 61, 3.97, 37),
	(8874, 'Hroziť pádom vlády, \r\nto je také české. \r\nAle ísť až do konca, \r\nto je slovenské.', 91, 4.24, 37),
	(8875, 'Bezdomovec v USA sedí na ulici a natiera si na chleba hovno. Stretne ho Obama a vraví mu:\r- Preboha, to ako môžeš takto jest? Ved nie sme krajina, ktorá by bola na tom tak zle.\r- Pozri, tu máš 500 dolárov a choď sa najesť do nejakej dobrej reštaurácie.\rBezdomovec v Rusku sedí na ulici a natiera si tiež na chleba hovno. Stretne ho Putin a vraví mu:\r- Preboha, to snáď nie sme na tom tak zle! Pozri, tu máš 100 stravných lístkov, to ti vystačí aj na celý mesiac. Choď a dobre sa najedz!\rBezdomovec na Slovensku sedí na ulici a natiera si rovnako hovno na chleba. Stretne ho Radičová, chvíľu na neho pozerá a vraví:\r- Ale no! Nie tak nahrubo! Aj zajtra je deň!', 693, 4.29, 37),
	(8876, 'Viete čo nevie Chuck Norris?\r\nVyžiť zo slovenského platu.   ', 64, 4.22, 37),
	(8877, 'Hovorí Radičová Galkovi:\r\n"Počúvaj..."\r\nA Galko jej hovorí: "Viem, počul som..."', 87, 4.22, 37),
	(8878, 'Ide Fico s manželkou po meste a pozerá sa za každou mladou ženskou.\r\nFicova manželka už toho má dosť a vlepí mu poriadnu facku.\r\nVtom pribehne postarší solídny pán a dá mu druhú, tretiu...\r\n"Čo mi mlátite muža?" spýta se rozčúlená Ficová.\r\n"Prepáčte," ospravedlňuje sa pán, "ja som si len myslel, že sa to už začalo!"', 347, 3.51, 37),
	(8879, 'Vodič uviazol v zápche na hlavnom ťahu do BA. Všetko okolo stojíi, žiadny pohyb, keď tu zrazu niekto klope na okno jeho auta. Vodič stiahne okienko a pýta sa, čo sa stalo. Muž mu vraví:\r\n"Teroristi uniesli poslancov a celú Národnú Radu Slovenskej Republiky. Pýtajú si 100-tis EUR výkupné, inak ich polejú benzínom a podpália. A tak tu teraz chodíme od auta k autu a robíme zbierku."\r\n"A koľko ľudia priemerne dávajú?"pýta sa vodič.\r\nMuž odpovedá: "Približne tak tri-štyri litre benzínu."', 522, 4.28, 37),
	(8880, 'Sedí v Bielom dome Obama a Klaus. Príde k nim jeden z hostí, ktorého zaujal ich družný rozhovor a pýta sa ich, o čom tak družne diskutujú. \r\nObama mu odpovedá: "Plánujeme tretiu svetovú vojnu.…"\r\nHosť na to: "To znie zaujímavo. A aké sú plány?"\r\n"Zabijeme 140 miliónov cigáňov a jedného zubára", vysvetľuje Obama. \r\nHosť sa zdá byť prekvapený. "Prečo zabijete jedného zubára?" \r\nKlaus sa usmeje a buchne Obama do chrbta: "Čo som ti vravel, nikto sa nebude pýtať prečo 140 miliónov cigáňov."', 530, 4.14, 37),
	(8881, 'Príde blondína ku gynekológovi a sťažuje sa.\r\n"Pán doktor mne na ohanbí nerastú vôbec žiadne chĺpky."\r\nDoktor sa zamyslí.\r\n"A koľko máte rokov?"\r\n"26."\r\n"No to by už naozaj rásť mali. A ako často sa milujete?"\r\n"No tak 25 až 30 krát týždenne."\r\n"Ale drahá slečna, na diaľnici tiež nerastie tráva."              ', 338, 3.93, 38),
	(8882, 'Riaditeľ si už hodnú chvíľu brúsi zuby na novú sekretárku. Konečne sa mu podarí pozvať ju na večeru. Ide do luxusného hotela, objedná apartmán, a v reštaurácii najlepší stôl. Ona príde a začne sa napchávať: studené predjedlo, teplé predjedlo, krabia polievka, hovädzia polievka, šalát, hydinové mäso, bravčové mäso, dezert, víno. Riaditeľ celý nažhavený a nedočkavý sa pýta: \r\n- Slečna to sa vždy takto napchávate?\r\nOna na to: \r\n- Ale nie nie, to len keď mám menštruáciu.              ', 534, 3.99, 38),
	(8883, 'Otec príde za svojou desaťročnou dcéroua hovoríjej:\r\n- Mali by sme si niečo povedať o sexe.\r\nDcéra na to:\r\n- A čo chceš vedieť ocko?              ', 157, 4.15, 38),
	(8884, 'Viete prečo Pán Boh stvoril ženu?\r\nPretože Adama veľmi bolela ruka.              ', 86, 3.85, 38),
	(8885, 'Kedy sa muž cíti ako lev?\r\nKeď má na chvoste peknú štetku.              ', 78, 3.9, 38),
	(8886, 'Francúz a rus pracujú v jednej firme. Francúz každé ráno vojde, sadne si, dá si prst pod nos, privonia a túžobne vzdychne: \'Susie.\' Tak sa to opakuje deň, dva a na tretí to už Rus nevydrží a spýta sa ho, čo to je. Francúz hovorí:\r\n- Vieš, ja ženu každé ráno obšťastňujem prstami a preto si ho voniam.\r\nNa druhý deň príde Francúz dnu, sadne si, privonia k prstu a hovorí:\r\n- Susie.\r\nRus na neho pozrie, priloží nos k ramenu, prevonia ho od hora až po prsty a hovorí:\r\n- Nataša.              ', 526, 3.84, 38),
	(8887, 'Sedí kňaz v spovedelnici a počúva:\r\n- Otče, mám 80 rokov a už som ženatý 50 rokov s mojou ženou. Celý život som jej bol verný, až do včera! Včera som sa vyspal s 20-ročnými dvojičkami!\r\n- Kedy ste boli naposledy na spovedi, dedko?\r\n- Ja? Nikdy! Ja som žid!\r\n- A prečo ste mi o tom prišli porozprávať do spovedelnice?\r\n- Viete, ja sa dnes s tým každému chválim.              ', 402, 4.19, 38),
	(8888, 'Príde chlapík za prostitútkou a pýta sa:\r\n- Za koľko by si šla?\r\nOna mu vraví:\r\n- Za päťsto.\r\nChlapík sa chytí za hlavu:\r\n- Päťsto? To je veľa, ja mám len stovku.\r\nBaba prevráti oči a povie:\r\n- Stovka je málo!\r\nA chlapík:\r\n- Ale mám aj mobil.\r\nOna porozmýšľa a hovorí:\r\n- Tak dobre. Stovka a mobil.\r\nKeď je po všetkom, chlapík sa oblečie a dáva jej sto korún.\r\n- A čo ten mobil? - pýta sa prostitútka.\r\n- Aha. No píš si 0905...              ', 476, 4.01, 38),
	(8889, 'Ležia na stole vedľa seba banán a vibrátor. Banán vraví vibrátoru:\r\n"Čo sa trasieš, ty somár, teba aj tak nezožerú."              ', 142, 3.97, 38),
	(8890, 'Na súde sudca znechutene poznamená:\r\n"Človeče, je to už váš 40-ty pokus\r\no znásilnenie. Som zvedavý, kedy sa vám to už konečne podarí!"              ', 162, 4.24, 38),
	(8891, 'Hovorí muž neznámej žene:\r\n"Slečna, tak sa na mňa pozeráte, akoby ste mali voľný byt."              ', 109, 3.72, 38),
	(8892, 'Stretnú sa traja zakrvavení upíri a rozprávajú si zážitky z uplynulej noci. Prvý, ktorý má krvavú celú tvár hovorí: \r\n"Vidíte ten dom s tými modrými okenicami? Tam býva jedna slečna, tú som vycical."\r\nDruhý, zakrvavený po pás hovorí:\r\n"Vidíte ten maják? Tam bývajú tri sestry, tie som vycical."\r\nA tretí, krvavý od hlavy po päty, hovorí:\r\n"Vidíte tú vežu s tými tromi oknami." Obaja upíri prikyvujú. "Ale ja som ju nevidel"              ', 475, 4.01, 38),
	(8893, 'Príde Záhorák domov a vidí ako jeho manželka súloží so susedom a kričí:\r\n"Ja som to vedel, ja som to vedel!"\r\n"Ty si to vedel a on to ešte stále vie!"              ', 176, 3.92, 38),
	(8894, 'Idú dva penisy na skúšku tvrdosti. Jeden dostane jednotku a druhý štvorku. Ktorý je na tom lepšie?\r\nNo predsa ten druhý - musí ešte ísť na ústnu skúšku.              ', 181, 4.15, 38),
	(8895, 'Stojí 50cent pri dieťati a decko hovorí:\r\n- Mother!\r\nA 50cent na to:\r\n- Cool, už vie pol slova!              ', 113, 3.66, 38),
	(8896, 'Hovorý ľavé vajce pravému:\r\n- Ide pekná baba!\r\n- Ako to vieš?\r\n- Šéf sa postavil.              ', 103, 4.03, 38),
	(8897, 'Stretne chlapík peknú slečnu a hovorí jej:\r\n"Slečna, nechcela by ste sa so mnou pomilovať?"\r\n"No dovolte, čo som ja nejaka prostitútka?"\r\n"Ale no to nie, veď kto tu hovorí o platení?"              ', 208, 4.01, 38),
	(8898, 'Niekto súloží každý mesiac.\r\nNiekto každý týždeň.\r\nNiekto každý deň.\r\nA ja si súložím kedy sa mi zachce.\r\nNapríklad, vlani sa mi nechcelo vôbec.              ', 176, 3.74, 38),
	(8899, 'Prídu dve priateľky na nudistickú pláž, vyzlečú sa a jedna hovorí:\r\n"Vyholila som sa dole, aby som bola príťažlivejšia.\r\nTá druhá jej hovorí:\r\n"Tak si daj kozy trochu nabok, nech je to vidieť."              ', 223, 4.04, 38),
	(8900, 'Malá Marienka sa pýta mamičky: \r\n"Mami, ako sa robia deti?"\r\nPo chvíli uvažovania matka hovorí:\r\n"No vieš Marienka, ocko dá mamičke vzácne semienko, z ktorého jej v brušku narastie dieťatko."\r\n"A to semienko musíš prehltnúť?"\r\n"Nooo...to len keď chcem nové topánky...."              ', 303, 4.12, 38),
	(8901, 'Každý pohárik chľastu skracuje život o 5 minút,\r\nkaždý sexuálny styk ho predlžuje o 3 minúty.\r\nTak alkoholici súložte, ide vám o život!!!              ', 166, 3.61, 38),
	(8902, 'Pribehne pán na stanicu, má dlhý baloňák\r\na onanuje...\r\nVýpravca naňho volá:\r\n"Pane, zbytočne sa honíte, už vám to ušlo..."              ', 150, 3.77, 38),
	(8903, 'Prečo v NDR neboli sexshopy?\r\nLebo jazda v trabante bola lepšia ako vibrátor.              ', 94, 3.74, 38),
	(8904, 'Hovorí prostitútka kolegyni: "Kúpila som si tchora, perfektne líže kundu."\r\nTa druhá na to: "A čo ten smrad?"\r\n"No týždeň grcal, ale potom si zvykol."\n', 161, 3.99, 38),
	(8905, '- Mara poď, budeme sa milovať.\r\n- Nemôžem.\r\n- Prečo?\r\n- Za prvé mi to zakazujú rodičia. Za druhé mi to zakazuje viera. Za tretie som ešte panna. A za štvrté ma potom vždy strašne bolia kríže.\n', 208, 4.14, 38),
	(8906, '"Pán vrchný, tá káva je cítiť dámskym prirodzením."\r\n"Tak si ju dajte do druhej ruky!"              ', 108, 3.98, 38),
	(8907, 'Rozprávajú sa dvaja kamaráti...\r\n- Už sa ti niekedy stalo, že ti tam zostal prezervatív?\r\n- Áno stalo.\r\n- A čo si urobil?\r\n- Chvíľku som počkal a potom som ho vysral!\n', 178, 4.08, 38),
