	(8918, 'Ide Angličan do Tunisu a vidí tam Araba v stánku. \r\n"Prosím si bedničku Coca-Coly." \r\n"Jeden dolár, prosím."\r\n"Také lacné? A čo stoji tamten bourbon?"\r\n"Jeden dolár, prosím."\r\n"Také lacné? Preboha, však všade to majú také drahé..."\r\n"Ja obchodník. Hore moja šéf. On jebať moja žena. A ja jebať jeho biznis!"              ', 346, 4.2, 38),
