	(8926, 'Chlapík ide autom neskoro v noci po lese. V tom spoza stromu vybehne trpaslík so samopalom a prinúti ho zastaviť. \n"Vystúp z auta!" kričí naňho. Chlapík poslušne vystúpi a celý sa trasie o svoj život. \n"Vyhoň si ho!" kričí trpaslík. \n"Čože?" nechápavo sa pýta chlapík.\n"Vyhoň si ho lebo ťa prevŕtam guľkami!"\nChlapik si teda z obavy o život vyhoní vtáka.\n"Vyhoň si ho ešte raz!" vraví trpaslík.\n"Už nevládzem" vraví chlapík.\n"Masturbuj lebo ťa odbachnem!" reve trpaslík.\nChlapík si teda vyhoní po druhý raz.\n"A poďme, ešte raz!" ziape  trpaslík.\n"Už skutočne nevládzem, nedá sa to" úpenlivo prosí chlapík.\n"Nekecaj a hoň si ho, hoci sa tu rozleješ na blato!" vrieska  naňho trpaslík.Chlapík si teda po strašnej námahe vyhoní po tretí raz, spadne na zem, nevládze už ani dýchať a zvíja sa od úmoru. Vtom sa trpaslík otočí smerom do lesa a zvolá: \n"Snehulienka, môžeš vyliezť, tento milý pán ťa odvezie na stanicu!"              ', 1005, 4.03, 38),
