	(8975, 'Príde manžel domov a v posteli uvidí svoju manželku s cudzím chlapom. Schmatne ho, vyhodí ho z okna a kričí za ním: ,, Ak máš lepšieho vtáka, tak lietaj! "', 168, 3.63, 38),
