	(8977, 'Príde Fero do krčmy a nesie so sebou krabicu od topánok. Príde k pultu otvorí ju a všetci len zírajú. V krabici sú dvaja malilinkí chlapíci oblečení v bielom a hrajú tenis. Krčmár Mišo vraví:\r\n- Krucinál Fero, kde si to zohnal?\r\n- Ale... našiel som takú malú fľaštičku, otvorím ju, vyletel z nej džin a on mi to...\r\n- Požičaj mi ju. - prosí krčmár Mišo.\r\nFero flašičku Mišovi požičal. Ten ju otvoril, vyletel z nej džin a vraví Mišovi:\r\n- Čo si želáš, môj pane?\r\n- Želám si plnú komoru doláčov! - rýchlo odpovedá Mišo a ihneď sa aj poberie do komory. Po chvíli sa rozčúlený vráti:\r\n- Čo je hluchý ten tvoj džin. Pýtal som plnú komoru doláčov a tam je plná komora koláčov.\r\n- A čo si myslíš, - reaguje smutne Fero - že ja som chcel 30 centimetrový tenis? ', 829, 3.93, 38),
	(8978, 'Príde chlapík do obchodu a prosí si jeden kondóm. Po chvíli príde zas a predavačke hovorí, že ten kondóm je prasknutý. Predavačka mu dá druhý, a tak sa to opakuje 4 razy. Až 5 raz sa predavačka ide pozrieť do skladu a tam škriatok nafukuje kondómy, prepichuje ich ihlou a popri tom si spieva: \r\n"Ja mám deti rád, som ich kamarát." ', 353, 3.74, 38),
	(8979, 'Pirát pláva v člne po mori a na oku má pásku. Vedľa neho pláva hovno. \r\nKoľko hovien vidí? \r\n Dve. Jedným okom vidí hovno a druhým okom hovno vidí.', 160, 3.88, 38),
	(8980, ' "Asi budem chorá, už druhý deň ma bolí hrdlo," hovorí sekretárka účtovnícke.\r\n"Tak na to viem skvelý recept,"odpovie jej ona.\r\n"Mňa keď bolelo minule hrdlo, vyfajčila som mužovi a bola som ok."\r\nNa druhý deň sa sekretárka vrhne k účtovníčke a nadšene jej hovorí:\r\n"Ty, naozaj to pomohlo.\r\nVyfajčila som včera tvojmu mužovi a on ani nemohol uveriť, že to bol tvoj\r\nnápad!\r\n', 403, 4.06, 38),
	(8981, 'Je veľká tlačenica v električke. Pani, snažiaca sa zachrániť pred pádom pri brzdení električky, zachytí sa omylom údu vedľa stojaceho pána.\r\n- Prepáčte, nechcela som.\r\n- Pani, či chcela, či nie, ja som šachista a tam platí, že kto už chytil figúrku, musí s ňou dohrať!', 294, 3.81, 38),
	(8982, 'Manželia majú kvôli deťom na sex dohodnuté tajné heslo "Ideme prať".\r\nV utorok sa pýta muž ženy:\r\n-Miláčik ideme dnes prať?\r\nOna mu odpovie:\r\n-Dnes nie, bolí ma hlava.\r\nTak sa to opakuje každý jeden deň až na nedeľu, kedy sa žena opýta muža:\r\n-Tak čo ideme dnes prať?\r\nA on odpovie:\r\n-Nie drahá, už som si vypral v ruke.', 346, 4.09, 38),
	(8983, '- Viete, aká je to poloha na mlyn?\r\n- Žena si ľahne na zem, a muž jej naští na lopatky.', 93, 3.11, 38),
	(8984, 'Otec so synom na trhu chcú kúpiť kravu. Otec kravu ohmatáva, obzerá vemeno, potľapkáva. O týždeň dobehne malý za otcom na pole a už zďaleka kričí: "Otec, hybaj domov, sused chce kúpiť mamu!"', 207, 4.07, 38),
	(8985, 'Farmár si zavolá ženu, ktorá rozumie reči zvierat.Idú za prasaťom. \r\nPrasa quí quí.\r\n"Čo povedalo?"\r\n"Že je prežraté a máte ho zabiť."\r\n"No máte pravdu už dlhšie sa na to chystám."\r\nKrava múú múú.\r\n"Čo povedala?"\r\n"Máte jej dávať viac piť a žrať."\r\nIdú za ovcou.Ovca méé méé, farmár ju chytí okolo krku a hovorí:\r\n"Drž hubu to bolo len raz a to som bol ožratý!"', 402, 4.15, 38),
	(8986, 'Stretnú sa traja kamoši a rozprávajú sa o svojich sexuálnych dobrodružstvách. Prvý hovorí: "Chalani, ona a ja 5-krát, bolo to super." Druhý na to: "Chalani, ja a ona 10-krát, nedá sa to ani opísať"Tretí sa na nich pozrie a smutne vraví: "Chalani, ja 20-krát, ale ona neprišla."\r\n', 298, 3.82, 38),
	(8987, 'Viete ako sa volá Snehulinka, ktorá žije so siedmymi impotentnými trpaslíkmi?\r\n? \r\nNo predsa Palculienka.', 110, 3.38, 38),
	(8988, 'Sedia muž a žena mlčky pri večeri a zrazu žena vstane a strelí mužovi facku.\r\nTen sa udivedene pýta: "Za čo?".\r\nŽena odpovie: "Za 20 rokov nekvalitného sexu".\r\nĎalej mlčky večerajú, keď muž vstane a strelí facku žene.\r\nKeď sa žena opýta, za čo bola tá fakca, muž odpovie:" A ty odkiaľ vieš o kvalitnom sexe?"', 335, 4.12, 38),
	(8989, 'Žena leží už dlhšiu dobu v nemocnici v kóme. Doktor rozhodne, že to vzdáva a povie sestričkám, aby ju umyli. Keď jedna sestra zájde špongiou medzi ženine nohy, naraz EKG začne rýchlo pípať. Vyskúša to ešte raz a EKG znovu zapípa. Rýchlo zavolajú manžela tej ženy a hovoria mu: "Síce to znie hlúpo, ale vašej žene by teraz najviac pomohol trochu orálneho sexu." Manžel sa síce dosť čuduje, ale nechá sa presvedčiť. Nechajú ho samého s manželkou, aby na to mal súkromie. Po chvíli manžel vyjde z izby, naťahujúc si nohavice a hovorí:\r\n "Asi ju to udusilo..."', 603, 4, 38),
	(8990, 'Príde blondínka do e-mailového centra a chce poslať matke správu. Zamestnanec jej oznámi, že to bude stáť 3.000,-Sk. Lenže blondínka toľko peňazí so sebou nemá, a tak hovorí zamestnancovi, že je ochotná urobiť všetko preto, aby mohla matke e-mail poslať. Muž zdvihne obočie a pýta sa: "Naozaj všetko?""Áno." - blondínka odpovie."No tak poďte so mnou." - hovorí jej zamestnanec.Blondínka za ním vzorne cupitá dozadu.\r\n"Poďte ďalej" - hovorí jej a zároveň zatvára dvere. Potom nariadi, aby si kľakla, otvorila jeho poklopec a vybrala ho... Tak to blondínka vzorne\r\nvykoná, chytí jeho penis do oboch rúk a čaká. Muž zatvorí oči a rozkáže:\r\n"No, prosím, pokračujte!"Ona pomaly priblíži svoje ústa k jeho penisu a ticho zašepká: "Ahoj mami, počuješ ma?" ', 808, 3.97, 38),
	(8991, 'Príde chlapček k oteckovi a pýta sa ho: "Oci, aký je rozdiel medzi teoretickým a praktickým???"Otec mu odpovedá: "Choď k mamičke a spýtaj sa jej, či by dala za 20.000 korún a potom s tou istou otázkou choď za svojou sestrou."Syn sa po chvíli vráti späť a hovorí otcovi: "Oci, obe povedali áno.""No vidíš, teoreticky máme 40.000 korún a prakticky máme 2ku.vy v dome..."', 393, 3.93, 38),
	(8992, 'Sedí babka na lavičke, vtom k nej príde druhá babka a hovorí jej: "Pani, neseďte na tej lavičke, je na nej nápis, že je čerstvo natretá." A babka sa zamyslí a po chvíli hovorí:"Ale ja už týmto nápisom neverím. Minule bolo na jednej lavičke napísané Pretiahnem ťa a sedela som tam tri hodiny a nič sa nestalo."', 332, 3.76, 38),
	(8993, 'Sedí v parku na lavičke mladá žena a číta si.\r\nTu náhle zbadá ako sa k nej veľmi rýchlo blíži ušpinený chlap s roztiahnutými rukami.\r\n"Preboha", pomyslí si žena,"isto ma chce znásilniť..."\r\nZačne sa tedy pripravovať na svoj osud. Vyzlečie si postupne kabátik, rozopne si halenku, vyzuje si topánky...to aby jej to násilník nezničil.\r\nA chlap už sa blíži...\r\nŽena, celá roztrasená, vstane z lavičky.\r\nChlap už je takmer u nej, keď v tom na ňu zakričí:\r\n"Uhni, ty kurva, nesiem sklo...!!!"\r\n', 528, 4.22, 38),
	(8994, 'Erža hovorí Anderovi:\r\nAnder, ty ši jak ťava ale ťava menej pije a viac robi. A ty vacej piješ a menej robiš. ', 117, 2.96, 38),
	(8995, 'Ide muž do erotického salóna a akciu "Za 100, 200 a 300 korún". Muž povie, chcel by som vyskúšať tú za 100, zo salóna vybehne krásna kočka a povie mu:"Ak má chytíš, môžeš si so mnou robiť čo chceš..." Muž uteká, schudne pritom 5kg, pomiluje ženu. Príde zas a povie, chcem tú za 200, zo salóna vybehnú 2 kočky a povedia to isté. Muž schudne 7kg a pomiluje obe ženy. Nakoniec príde tretí raz a povie, že chce tú za 300. Zo salónu vybehne svalnáč a kričí:"Utekaj, pravidlá poznáš..."', 524, 4.05, 38),
	(8996, 'Pýta sa Jožko otca:\r\n- Oci, čo dostanem na Mikuláša?\r\n- Lopatu.\r\n- A načo mi bude lopata?\r\n- Aby si si mohol odpratať to veľké hovno čo nájdeš na Vianoce pod stromčekom.', 182, 4.18, 38),
	(8997, 'Miluje sa indiánsky pár a po 3 dňoch bez prestávky hovorí muž žene:\r\n"Drahá, teraz ma 3 dni neuvidíš!"\r\n"Ideš na lov?" potešila sa žena.\r\n"Nie, idem odzadu!"', 170, 4.04, 38),
	(8998, 'Idú traja chlapi - alkoholik, fajčiar a homosexuál, po meste. Zrazu sa pred nimi zjaví Boh a hovorí im:"Ak budete aj naďalej páchať tieto hriechy, tak do vás strelí blesk."Chlapi mu však neveria a keď alkoholik zbadá fľašu vodky vypije ju a hovorí: "Vidíte, nič sa mi nestalo." BUM! Po chvíli strelí do alkoholika blesk.Fajčiar a homosexuál začnú po tomto zážitku veriť slovám Boha a zdržia sa svojich hriechov.Fajčiar však nemôže vydržať a chce sa zohnúť pre cigaretu. Homosexuál mu hovorí: ""Nezohýňaj sa pre tú cigaretu, lebo zomrieme obaja."', 587, 4.08, 38),
	(8999, 'Čúrajú dvaja chlapi z mosta do rieky a jeden hovorí: "Aká je tá voda studená." Druhý na to: "No hej, ale aká je hlboká."', 130, 3.97, 38),
	(9000, 'Vtip z dvoch slov:  Žid baníkom.                            ', 62, 2.93, 38),
	(9001, '- Ženám treba pozerať na nohy?\r\n. Prečo?\r\n- Lebo podľa koľajníc súdim stanicu. ', 87, 3.58, 38),
	(9002, 'Redaktorka sedí v jednej dedinskej krčme a chlapi jej vravia: "Pani redaktorka na našom salaši žije bača, ktorí má najväčší k...t na svete" \r\nZvedavá redaktorka sa vyberie na salaš zaklope na dvere a otvorí jej bača. Redaktorka s ním chce spraviť reportáž tak sa ho teda pýta: \r\n"Bača ževraj máte najväčšieho na svete." "Áno to je pravda" privsvedčí jej. "Tak môžem si ho teda odmerať?" po chvíli mu redaktorka hovorí: "bača ale to je iba 15 cm veď to sú aj väčšie" \r\nBača sa uškľabí a povie: "Pani redaktorka ale keď tlesknem tak sa mi o meter zväčší" Bača tleskne raz o meter sa mu zväčšil. Redaktorka ostala v nemom úžase bača tleskol dvakrát o dva metre sa mu zväčšil. Redaktorka strach v očiach začne utekať. Ako tak ju bača sledoval oprel sa o verandu a začal tlieskať: " Len si bež! Mne aj tak neujdeš!"\r\n', 881, 4.06, 38),
	(9003, 'Manželia sú na večeri v reštaurácii. Manželka vyznáva mužovi lásku:\r\n"Miláčik, ja ťa tak ľúbim, až ma pri srdiečku hreje."\r\nManžel na to: "Bodaj by nie, keď máš prsník v polievke."', 201, 4.16, 38),
	(9004, 'Muž príde opitý z krčmy domov a pýta sa manželky:\r\nMiláčik zasexujeme si?\r\nManželka na to: „Nie, mám to!“\r\nMuž ju nepočúva, a po dlhom prehováraní ju presvedčí.\r\nPo vášnivom sexe ide manžel do kúpeľne, pozrie sa do zrkadla a zhrozene hovorí: „Preboha ja som ju zabil... Preboha ja som ju aj zožral!“\r\n', 333, 3.45, 38),
	(9005, 'Príde malý Jožko do drogérie rozkopne dvere, buchne päsťou po pulte a hovorí predavačke: "Daj mi krabičku kondómov."\r\nPredavačka sa na neho pozrie a milo sa mu prihovára: "Jožko, keď vstupuješ do predajne, musíš pekne otvoríť dvere a slušne sa pozdravíš. A odkáž ockovi nech si príde pre krabičku kondómov sám."\r\nJožko sa nahnevá a odpovedá: "Tak po prvé, doma dvere nemáme, po druhé ku*vám sa nezdravým a po tretie súložiť idem ja a nie otec!"', 483, 4.15, 38),
	(9006, 'Nealkoholické pivo je ako porno v rádiu.', 42, 3.8, 38),
	(9007, 'Chváli sa bacil druhému: Keby si videl akú krásku som stiahol do postele!', 77, 4.18, 38),
	(9008, 'Pýta sa doktor pacienta: Fajčíte?\r\n- No aj áno, ale keď si dám už 5, vyfajčím aj celú krabičku.\r\n- Pijete alkohol?\r\n- No aj áno, ale keď sa rozbehnem tak vypijem aj 6 fliaš\r\n- Sexujete?\r\n- No aj áno, ale keď sa rozbehnem, sexujem a celý deň.\r\n- No a šak to je normálne.\r\n- No, ale na farára z takej alej dediny....', 335, 4.15, 38),
	(9009, 'Volá robotník stavbivedúcemu:Dobrý šéfko.Počuvajte ma,dnes nemožem prísť lebo ma bolí hava.\rŠéf na o:Počuvaj,toto mi nerob.Vieš čo ja robím,keď mi je zle?!!Vyspím sa s manželkou,Vypijem si pivo,vyspím sa a hneď mi je lepšie.Skús to.-\rO hodinu volá robotník šéfovi:Hej,šéfe.Zabralo to,už sa cítim lepšie.Ozaj a máte prekrásny dom!!!', 366, 4.04, 38),
	(9010, 'Chlapec vojde do izby svojich rodičov a vidí, ako súložia. Otec sa zasmeje a hodí po ňom vankúš. Po chvíli otec začuje zvuky z chlapcovej izby. Vojde dnu a vidí ako ich syn súloží s babkou. Chlapec sa otočí a hovorí:\r\n- Už to nie je také smiešne, keď ja súložím s tvojou mamou, čo?', 306, 4.11, 38),
	(9011, 'Oproti sebe po ceste idú dvaja rómovia. Prvý sa pýta toho druhého:                         \r\n- Kam ideš?                                \r\n- Idem kúpať.                                   \r\n- Koho?                                           \r\n- Sa.', 253, 3.03, 39),
	(9012, 'Cigáň príde v Bratislave na stanovisko taxíkov k autu a vraví:\r\n- Na letisko, brat môj.\r\n- Díva sviňa je ti bratom! \r\n- Tisíc korún, brat môj!\r\n- Sadaj, brat môj!', 174, 3.35, 39),
	(9013, 'Cigáňa na stavbe pristaví majster a hovorí:\r\n- Prečo chodíš s prázdnym fúrikom,?\r\n- Ale viete čo, pán majster, tak mi zvýšili normu, že mi nestačia nakladať.', 173, 3.31, 39),
	(9014, 'Na námestí je demonštrácia rómov za prácu. Protestujú, že ich nechcú zamestnávať, lebo sú rómovia. V dave sa objavujú heslá: "My chceme prácu", "Zamestnanie aj rómom", "Stop diskriminácii rómov pri prijímaní do zamestnania" a podobné (vtipné) heslá. Zrazu pri dave zastane autom podnikateľ a na jedného z nich zakričí: \r\n- Hej Dežo, mám pre teba prácu, pod robiť.\r\nA Dežo: \r\n- Prečo ja?', 420, 3.51, 39),
	(9015, 'Policajti kričia na cigáňa:\r\n- Cigáň stoj!\r\nA cigáň kričí: \r\n- Ja som ho nezabil.\r\nPolicajti: \r\n- A ten nôž?\r\nCigáň: \r\n- To nie s tým. ', 149, 3.62, 39),
	(9016, 'Róm sa pýta lekára, že kde má žena srdce.\r\nLekár povie, že pod prsníkom. \r\nVečer nájdu postrelenú manželku rovno pod kolenom.', 138, 3.12, 39),
	(9017, 'Počuli ste už o novej cigánskej barbie? Obsahuje 1 barbie, 12 detí a podporu...', 83, 3.24, 39),
	(9018, 'Príde cigánka do trafiky:\r\n- Dik daj mi jedny Sparty!\r\nTrafikantka sa jej opýta:\r\n- Mäkké alebo tvrdé?\r\nCigánka sa rozčúli:\r\n- Dik jaká si zvedavá!', 158, 3.36, 39),
	(9019, 'Cigáň v drogérii:\r\n- Jeden dezodorant!\r\n- Guličkový?\r\nCigáň sa naštve:\r\n- Jak na gule?! Pod pazuchy, néé?!', 116, 3.51, 39),
	(9020, 'Príde tehotná cigánka do ordinácie gynekológa a hovorí:\r\n- Dobrý deň, Ivana Biháriová, 14 rokov, 5.B', 110, 3.53, 39),
	(9021, 'Dežo, ako by si definoval ŽIVOT?\r\n- Život je ako slepačí rebrík. Veľmi krátky, ale celý osratý.', 105, 3.11, 39),
	(9022, 'Ide róm cez prechod pre chodcov a hovorí si:\r\n- Vidia ma, nevidia ma, vidia ma, nevidia ma...', 95, 3.52, 39),
	(9023, 'Viete, prečo je u cigáňov taky bordel?\r\nPretože Majster Proper je skín.', 76, 3.88, 39),
	(9024, 'Na linku dôvery vola mladá cigánka:\r\n- Dobrý deň, tu je Aranka zo Spiša. Mám už dvanásť rokov a ešte stále nie som tehotná. Chcem sa teda opýtať, že či je môj otec homosexuál?', 194, 3.65, 39),
	(9025, 'Príde Gejza domov a zistí, že jeho manželka kúpila novú varechu. Okamžite ju začne mlátiť a pritom kričí: \r\n- Je toto normálne? Doma nie je ani kvapka alkoholu a milostivá si nakupuje nábytok!', 207, 3.3, 39),
	(9026, 'Gazda sadí na poli zemiaky. Okolo ide cigáň a pýta sa ho. \r\n- Gazda, a pre seba tohto roku nesadite?', 104, 3.57, 39),
	(9027, 'Kúpe cigánka v zime dieťa v jazere. To plače na ratu. Cigánka mu hovorí:\r\n- Čo plačeš, šak neni horúca.', 114, 3.66, 39),
	(9028, '"Cigáň, ty si primitív!"\r\n"Pri čom som?"', 44, 3.6, 39),
	(9029, 'Cigáň sa pýta maminky:\r\n"Mami, majú hrozienka nohy?"\r\n"Nie."\r\n"Tak som zjedol pavúka."', 91, 3.79, 39),
	(9030, 'Malý Dežko našiel kávovú lyžičku. Ukázal ju otcovi a pýta sa: \r\n- Tato, čo to je?\r\nDežo sa pozrie na lyžičku a zhrozene vykríkne: \r\n- Ihneď to zahoď, to je semiačko lopaty!', 189, 3.73, 39),
	(9031, 'Malý Dežo natiera plot na bielo a svojou nešikovnosťou sa celý poleje. Ide za mamou pochváliť sa, že je biely, ale ta perie a tak mu povedala, nech ide za otcom. Otec\r\npozerá futbal a povedal mu nech ide preč. Ako malý Dežko odchádza, takto si mrmle pod nos:\r\n- Päť minút som biely a už má vy cigáni serete!', 326, 3.7, 39),
	(9032, 'Dežo pozerá celý večer u susedov porno a celý nadržaný uteká domov, aby pomiloval Araňu. Ako uteká, kričí už vo dvore:\r\n"Araňa, dnes ťa tak pomilujem, že z toho umrieš." \r\nVrazí domov, uvidí tučnú lenivú Araňu rozvalenú na gauči a povie:\r\n"Vieš čo Araňa? Ži si."', 291, 3.33, 39),
	(9033, 'Ako sa začína cigánska kuchárka?\r\nUkradneme si tri vajcia.', 62, 3.64, 39),
	(9034, 'Viete, čo je šváb v zápalkovej škatuľke? \r\nCigánske tamagoči.', 69, 4.09, 39),
	(9035, 'Cigáň kradne drevo v hore. Ide okolo horár a kričí:\r\n- Cigáň, čo kradneš to drevo?\r\nCigáň: \r\n- Tto je pre kravy.\r\n- Hej? A odkedy kravy žerú drevo?\r\n- Čo nezožerú, popálim.', 189, 3.43, 39),
	(9036, 'Dežo prišiel k lekárovi a hovorí:\r\n"Pán doktor, poraďte mi. Nedarí sa nám orálny sex. Araňa vraví, že ona z toho nič nemá"\r\n"Skús si ho natrieť Nutelou", vraví lekár.\r\nO týždeň príde Dežo:\r\n"Ďakujem pán doktor za radu. Bolo to výborné."\r\n"A čo Araňa?"\r\n"Ona z toho zasa nemala nič, deti ju predbehli!"', 331, 3.92, 39),
	(9037, 'Ako sa povie Spišská Nová Ves po Španielsky?\r\nRio Negro.', 60, 3.46, 39),
	(9038, 'Rozprávajú sa dvaja rómovia caz vysielačku a jeden sa pýta druhého:\r\n- Dežo, aký máš príjem?\r\n- Zase vyrývaš?!', 123, 3.03, 39),
	(9039, 'Cigáň kradne drevo a chytí ho lesník:\r\n- Cigáň, čo tu kradneš?\r\nCigáň hovorí: \r\n- To je krmivo pre kravy.\r\n- Odkedy kravy žerú drevo?\r\n- Čo nezožerú, spálim.', 174, 3.32, 39),
	(9040, 'Vojde sprievodca do kupé kde je osem rómov!\r\n- Lístky si prosím!\r\nJeden z nich mu podá lístky.\r\n- Vás je tu osem!\r\n- Šak hej!\r\n- Ale lístkov je len sedem!\r\n- Šak hej!\r\n- Jeden z vás cestuje na čierno!\r\n- Šak hej! Ale ktorý?', 237, 3.66, 39),
	(9041, 'Prečo všetci mladí rómovia nosia fúzy?\r\nTo aby sa viac podobali svojej matke.', 82, 3.44, 39),
	(9042, 'Vieš, prečo sa rómovia zjednotili?\r\nLebo v Jednote je alkohol, cigarety, káva...', 84, 3.53, 39),
	(9043, 'Rozprávajú sa dvaja rómovia.\r\n- Čo ty stále doliezaš za mojou sestrou? Nemáš svoju?', 91, 3.56, 39),
	(9044, 'Prichytili cigáňa, ktorý si to rozdával zo svojou 13 ročnou dcérkou. \r\n- Dežo, ty si pedofil!\r\n- Ja nie, prosím pekne, ja som iba nedočkavý.', 150, 3.18, 39),
	(9045, 'Policajt vyčíta Dežovi: \r\n- Dežo, ty si pedofil !      \r\nDežo na to: \r\n- Nie pán policajt, ja nie som pedofil, ja som len nedočkavý.', 140, 3.04, 39),
	(9046, 'Dežo z Hornej Lehoty si berie Eržiku s Dolnej Lehoty. Prídu kamaráti a hovoria: \r\n- Dežo, čo si somár? Prečo si ju berieš? Veď Eržika je kurva, veď sa vyspala s celou Dolnou Lehotou!\r\nA je po obrade. Na ďalšiu sobotu opäť Dežo z Hornej Lehoty si berie Eržiku s Dolnej Lehoty. Prídu kamaráti a hovoria:\r\n- Dežo, si somár či čo? Sme ti povedali, že Eržika je kurva, že sa vyspala s celou Dolnou Lehotou!\r\n- No a čo, som sa tam bol pozrieť, veď to nie je taká veľká dedina!', 503, 3.28, 39),
	(9047, 'Doteraz som bol presvedčený, že pálenka je len na pitie. Po rómskych rabovačkách už viem, že pálenka sa dá aj jesť.', 127, 3.06, 39),
	(9048, 'Skupina rómov vykrikuje na námestí do kamier večerného spravodajstva:\r\n- My chceme prácu, my chceme prácu...\r\nZastaví sa pri nich auto, vyjde chlap a na jedného róma ukáže prstom:\r\n- Tak poď, dám ti prácu.\r\nA róm na to:\r\n- A prečo práve ja?', 258, 3.44, 39),
	(9049, 'Stretnú sa dvaja rómovia na východnom slovensku. \r\n- Hej Fero, čo to nesieš v tom vreci?\r\n- Ale, bol som na nákupe.', 121, 3.61, 39),
	(9050, 'Dežo číta v novinách:\r\n"Hľadá sa muž vo veku asi 40 rokov, ktorý v noci na opustených miestach prepadáva ženy, obchytkáva ich a ukazuje im svoje prirodzenie."\r\nOtočí sa na manželku, prečíta jej inzerát a hovorí:\r\n- Eržika, myslíš, že by ma na to miesto zobrali?', 284, 3.67, 39),
	(9051, 'Príde cigáň na polícu a hovorí:\r\n"Pán policajt, stratila sa mi matka."\r\nPolicajti ju nenašli a policajt ide za cigáňom a hovorí:\r\n"Pán cigáň vašu matku sme nenašli."\r\nCigáň potom povie:\r\n"Nevadí aj tak bola hrdzavá."', 235, 3.13, 39),
	(9052, 'Prečo sú cigáni menšina?\r\nLebo väčšina je vo väzení.', 61, 3.79, 39),
	(9053, 'Dežo robí na stavbe a príde za ním žena. Vtom Dežo spadne do vane s vápnom a začne kričať:\r\n- Erža, Erža, čo mám robiť?\r\nErža si vzdychne a apaticky odpovie:\r\n- Vidíš ho, len chvíľu je biely a už by chcel robiť!', 233, 3.21, 39),
	(9054, 'Tesne pred vianocami príde Dežo za susedom, ktorý pracuje v zámočníckej dielni.\r\n- Sused, potrebujem urobiť pre deti stojan na vianočný stromček.\r\n- Dežo, mal si prísť skôr, teraz nemám čas.\r\nA Dežo hovorí:\r\n- Nevadí, môže byť aj po vianociach, len nech je dobre ťažký.', 294, 2.85, 39),
	(9055, 'Stretnú sa dvaja rómovia. Jeden hovorí:\r\n- Keď sa vyspím s tvojou ženou, čo si budeme, švagrovia?\r\n- Dilino, budeme si predsa kvit.', 139, 3.22, 39),
	(9056, 'Prečo majú cigáni doma špinavo?\r\nLebo majster Proper je skinhead.', 69, 3.47, 39),
	(9057, 'Ako spravíte z cigáňa rastlinu???\r\nKastráciou! Bude z neho ČIERNY BEZ!', 75, 3.3, 39),
	(9058, '"Fuj cigáň po čom smrdíš?"\r\n"Ta po robote pan majster."\r\n"A čo robíš?"\r\n"Hovno."', 88, 4.08, 39),
	(9059, 'Ako sa povie Rómovi v obleku?\r\nObžalovaný vstaňte.', 54, 3.58, 39),
	(9060, 'Aký je rozdiel medzi rómom a rožkom?\r\nRožok v peci nereve!!!', 64, 3.57, 39),
	(9061, 'Príde malý rómsky chlapček domov do osady vysmiaty a hovorí mamičke:\r\n- Mamí, mamí, dnes sa pani učiteľka na hodine hudobnej výchovy rozplakala.\r\n- Fíha a prečo?\r\n- No vieš, začali sme spievať "KEĎ NÁS BUDÚ MILIÓNY".', 236, 3.57, 39),
	(9062, '- Dežo, kde robíš?\r\n- Na letisku.\r\n- A čo?\r\n- Lietam s fúrikom.', 68, 3.2, 39),
	(9063, '- Dežo, povedz lopata.\r\n- Aj tak robiť nebudem!', 49, 3.13, 39),
	(9064, 'Cigan vejde do hospody, kde je velmi rušno,pravě se hraje MS v ledním hokeji.Po chvíli tupého zírání se hlasitě zeptá:\r\n"JAK HRAJI NAŠI?"\r\nHospoda zmlkne a po chvilce mlčení se otočí na cigána jeden z přítomných a povídá:\r\n"VAŠI???..VAŠI tam vůbec nehrají..."', 284, 3.44, 39),
	(9065, 'Cigáň pije z potoka vodu.\r\nV tom ide okolo dedko a hovorí:\r\n"Človeče,nepite tu vodu,veď je otrávená!"\r\nCigáň sa otočí a pýta sa:\r\n"Čo hovoríš,zle počujem".\r\n"Nič,nič,len aby si pil pomaly,aby si neprechladol!!"', 229, 3.85, 39),
	(9066, 'Motto rómskej olympiády: Nieje dôležité zvíťaziť, ale vrátiť športové náradie.', 91, 3.54, 39),
	(9067, 'Deži a Araňa idú na výlet k jazeru. Večer sa idú kúpať "na holo". Kúpu sa a zrazu začne Araňa strašne kričať: \r\n- Dačo ma tlačí do pindy, jój, bolí, bolí!" \r\nDeži sa zľakne, vytiahne Araňu na breh, pozerá a tam spomedzi nôh jej trčia klepietka a bezmocne sa trepú vo vzduchu.  Deži sa zamyslí a hovorí: \r\n- Ty, počúvaj Araňa, však ty tam máš rakovinu!', 387, 3.09, 39),
	(9068, 'Príde jeden cigáň za druhým, celý dobitý a v čiernom. Druhý cigáň sa ho pýta: \r\n"Čo sa ti stalo?"\r\n"Ale umrela mi žena."\r\n"A prečo si taký dobitý?"\r\n"A vieš ako sa bránila?"', 191, 3.37, 39),
	(9069, 'Robí cigáň na stavbe pri miešačke.\r\nZrazu spustí veľký krik:\r\n"Majster, majster rýchlo prst mi utrhlo!"\r\n"A čo si robil ty somár?"\r\n"No aha, tu to som, takto sem, joj bodaj ho, už mi aj druhý utrhlo."', 213, 3.38, 39),
	(9070, 'Vychvaľuje sa na sídlisku róm:\r\n- Mám digitálne decko!\r\nSused:\r\n- Hej? A to ako?\r\n- Jednoducho. Nemá ručičky!', 117, 3.19, 39),
	(9071, 'Opitý rom ide večer domov. Ponáhľa sa a aby ho doma žena nezabila, tak si to strihne cez cintorín. A tam spadne do jamy, do ktorej mali niekoho na druhý deň pochovať. Skrčí sa v kúte a začne nariekať:\r\n- Jaj, je mi zima, vytiahnite má.\r\nIšiel okolo druhý Róm, a ten mu vraví:\r\n- A načo si sa odkopal?', 320, 3.19, 39),
	(9072, 'Padne cigáň na stavbe do vápennej jamy a keď ho s tadiaľ jeho súkmeňovci celého bieleho vytiahnu, cigáň pokrčí plecamy a bezradne hovorí:\r\n"Chlapi, čo budeme robiť?"\r\nJeden z jeho súkmeňovcov:\r\n"Pozrite ho, len chvíľu je biely a už myslí na somariny..."', 274, 3.16, 39),
	(9073, '- Ty Dežo, to veľké tetovanie na tvojom chrbte sa dá aj zmyť?\r\n- Ešte som to neskúšal.', 94, 3.13, 39),
	(9074, 'Zastaví sa chlapík pred výkladom s reklamou a číta - "Cigáni bez gumy za 100 Sk, bieli s gumou za 500 Sk". Zamyslí sa vojde do dverí a osloví zriadenca:\r\n"Ja som Cigáň a chcel by som to za 100 korún!"\r\nTen si ho premeria a hovorí: \r\n"Táák, Vy ste Cigáň?"\r\n"Ano."\r\n"A viete kde ste?"\r\n"Samozrejme, v bordeli."\r\n"Nie, tu sa prihlasuje na bungee junping!"', 369, 3.38, 39),
	(9075, 'Ide Araňa a Dežko po Hlavnej ulici v Košiciach. Araňa zrazu zastane a pýta sa Dežka.\r\nA: Dežko no vidíš tu krásnu dlažbu?\r\nD: No vidím...\r\nA: A nie si z nej fascinovaný?\r\nD: ...\r\nA: No nie si z nej fascinovaný?\r\nD: Araňa, keď ja som fas cínovaný, ta potom ty si kunda drevená!', 295, 3.59, 39),
	(9076, 'Príde cigáň do predajne a pýta sa:\r\n"Máte 40 000 suchých rožkov?"\r\n"Nemáme", odpovedá predavačka.\r\nNa druhý deň príde zas:\r\n"Máte 40 000 suchých rožkov?"\r\n"Nemáme."\r\nNa tretí deň:\r\n"Máte 40 000 suchých rožkov?"\r\n"Máme."\r\nA cigáň:\r\n"A kto vám to kúpi?"', 278, 3.4, 39),
	(9077, 'V balóne letia dvaja biely a jeden cigáň. Keď začali klesať,vyhodili všetky nepotrebné veci. Aj tak stále klesali. Chceli vyhodiť von cigáňa a vtedy sa objavil svätý Peter:\r\n"Nerobte to! Aká je to spravodlivosť? Dám každému z vás jednu otázku a kto mi na ňu odpovie zle, toho vyhodíme von! Pýta sa prvého bieleho:\r\n"Kedy bola prvá svetová vojna?"\r\n"V roku 1914."\r\nPýta sa druhého bieleho:\r\n"Zomrelo v nej veľa ľudí?"\r\n"Ano."\r\nSvätý Peter sa otočí na cigáňa a povie:\r\n"Vymenuj ich!!!"', 521, 4.09, 39),
	(9078, 'Už sa teším na svoje dni.\r\n-Ale Dežo, veď si nie žena!\r\n- Ale sociálku beriem ja!', 88, 3.44, 39),
	(9079, 'Jednej cigánskej rodine vyhorí dom. Cigán a cigánka stoja blízko dohorievajúcich trosiek a cigán zrazu povie:\r\n"Ty Mariša, cítim tu karamel."\r\nA cigánka na to:\r\n"Veď stará mala cukrovku."', 199, 3.67, 39),
	(9080, 'Na Spiši dobehne cigáň za farárom: \r\n- Narodila sa mi dcéra.\r\n- Gratulujem a aké meno jej dáme?\r\n- Žilina.\r\n- Ale Dežo, veď také nemôžem...\r\n- A synov ste mi mohli? Jeden je Martin a druhý Mikuláš.', 213, 3.24, 39),
	(9081, 'Američan hovorí:\r\n- Ja mám takú ženu, že keď si sadne na koňa, má nohy až po zem. Niežeby bol kôň taký malý, ale také krásne, dlhé nohy má.\r\nFrancúz hovorí:\r\n- Keď ja obopnem moje prsty okolo pásu mojej ženy, prsty sa mi spoja. Niežeby som mal také veľké ruky, ale taký tenký driek má moja žena.\r\nA cigáň hovorí:\r\n- Moja žena má taký zadok, že keď jej po ňom plesnem, ešte keď prídem z roboty sa trasie. Niežeby mala taký veľký zadok, ale ja tak skoro prídem z roboty.', 517, 3.63, 39),
	(9082, 'Otec príde domov a vidí,že mu v peňaženke chýbajú peniaze, hneď sa pýta syna:\r\n"Povedz pravdu."\r\n"Povedal  som."\r\n"Synak klameš."\r\n"Neklamemem."\r\n"Cigániš."\r\n"Necigánim."\r\n"Tak rómuješ...a vráť paniaze."', 220, 3.75, 39),
	(9083, 'Policajt naháňa róma a kričí: \r\n- Stoj! Stoj!!!\r\nRóm v plnom behu prehodí cez rameno: \r\n- Ty stoj, teba nikto nechytá.', 126, 3.37, 39),
	(9084, 'Stretnú sa na ulici dvaja cigáni. Pýta sa jeden druhého:\r\n- Deži, kam ideš?\r\n- Idem si kúpiť kabát.\r\n- Kúp aj mne, keď ťa nechytia.', 143, 3.31, 39),
	(9085, 'Prečo  si  rómovia  kupujú  tamagoči?\r\nMyslia  si,  že  im na  ne  budú  poskytované rodinné  prídavky.', 112, 3.4, 39),
	(9086, '- Čo je s Dežom, dlho som ho nevidel.\r\n- Otvoril si obchod.\r\n- Naozaj? A s čím?\r\n- So železnou tyčou.', 107, 3.32, 39),
	(9087, 'Stará cigánska múdrosť: \r\nUčme sa hudbe, lebo lepšie je mať na brade jeden mozoľ od husiel, ako na rukách desať od roboty.', 132, 3.21, 39),
	(9088, 'Dežo stretne Araňu a Araňa sa pýta Deža.\r\n- Ty Dežo, odkal máš tu Mazdu ha?\r\n- Čo ti ja vím, neboli v ni žádne doklady!', 131, 3.28, 39),
	(9089, 'Po ulici išiel dobrý, čestný Róm. Zrazu, z ničoho nič, pribehol k nemu zákerný dôchodca, napichol sa mu na nôž a vnútil mu svoju peňaženku.', 154, 3.62, 39),
	(9090, 'Kope Dežo s krompáčom kanál. Nad ním sa pristaví policajt a pozerá na neho. Dežo po chvíli prestane a povie policajtovi:\r\n- Čo pozeráš? Keby si sa lepšie učil, mohol si kopať so mnou.', 198, 3.59, 39),
	(9091, 'Dežo vyhral zájazd do Austrálie. Vystúpil z lietadla a hovorí dik-more, dik-kengura, dik-obraz.', 100, 3.07, 39),
	(9092, '- Cigáň, kde robíš?\r\n- Pri vysokej peci.\r\n- A čo tam robíš?\r\n- Zohrievam sa.', 83, 3.68, 39),
	(9093, 'Uprostred námestia v Amserdame sa bije veľká skupina Holanďanov s velkou skupinou Flámov. Lietajú dlažobné kocky, tečie krv a lámu sa kosti. Po čase zakročia policajné jednotky a obe skupiny rozoženú do protiľahlých rohov námestia. Len uprostred sedí malá skupinka cigáňov. V tom sa postaví vajda, pristúpi k policajtovi a hovorí:\r\n- A mi Belgičania gde?', 380, 3.1, 39),
	(9094, 'BLAHOŽELÁME: \r\nV našom žrebovaní ste vyhrali rómske dieťa. Vyzdvihnite si ho do 14 dní, inak vám pošleme celú rodinu.', 128, 3.62, 39),
	(9095, 'Dežo, kde robíš?\r\n- U brata.\r\n- A brat kde robi?\r\n- Zháňa robotu.', 70, 3.65, 39),
	(9096, 'Píše rómske dievčatko do poradne. \r\n\'Mám 11 rokov a ešte som panna. Myslíte že je môj otec homosexuál?\'', 113, 3.56, 39),
	(9097, 'Hádka v cigánskej rodine:\r\n- Juj, ty Mara, zavri tú chrapu, bo ti ju dačím zapchám! \r\n- Ej, ty machirek, ty by si len sexúval!', 133, 3.15, 39),
	(9098, 'Cigáň príde so synom k doktorovi, plesne ho po chrbáte a hovorí: \r\n- Dežko! Poriadne sa narovnaj, nech pán doktor vidí, aký si krivý!', 143, 3.4, 39),
	(9099, 'Do kedy je mladá cigánka pannou?\r\n1. Do vtedy, pokiaľ je silnejšia ako mladší brat.\r\n2. Do vtedy, pokiaľ je rýchlejšia ako starší brat.\r\n3. Do vtedy, pokiaľ sa otec vráti s basy.', 191, 3.51, 39),
	(9100, 'Malý róm stretne na ulici chlapca z vedľajšieho domu a pýta sa ho: \r\n- Hádaj čo dostanem na Vianoce?\r\n- Čo?\r\n- Tvoj bicykel.', 132, 3.65, 39),
	(9101, 'Viete aký je rozdiel medzi Maradonom a Cigánom?\r\nMaradona kope za Argentínu, zatiaľ čo cigán za Telekomunikácie.', 119, 3.65, 39),
	(9102, 'Čo je to cigánsky trojboj?\r\nCigan beží na kúpalisko, tam si zapláva, a domov ide na bicykli.', 98, 3.75, 39),
	(9103, 'Príde tmavý občan Slovenskej Republiky ku druhému a pýta sa.\r\n- Gejza ta šo robíš.\r\n- Nič.\r\n- Ta ci pomožem, hej?', 123, 3.34, 39),
	(9104, 'Róm na smrteľnej posteli hovorí svojim deťom:\r\n"Deti moje, chráňte židov!"\r\nPrítomní sa popozerajú po sebe, mlčia a on znova:\r\n"Deti moje chráňte židov!"\r\nNa to sa ozve najstarší syn:\r\n"Otec, ty už nevieš, čo hovoríš, veď blúzniš, načo by sme ich mali ochraňovať?"\r\n"Lebo keď ich všetkých pobijú, tak pôjdu po nás!"', 348, 3.35, 39),
	(9105, 'Čo urobí cigáň, keď skončí vysokú školu?\r\nPresunie lešenie na vedľajšiu budovu.', 91, 3.39, 39),
	(9106, 'Stopuje róm na diaľnici. Nikto mu nechce zastaviť, až po dlhej dobe mu zastaví skín. Róm:\r\n"Prosím Ťa zober ma do mesta. Žena mi ide rodiť."\r\nSkín pozerá na neho a hovorí mu:\r\n"OK, ale pod jednou podmienkou!"\r\n"Jasne, všetko na svete."\r\n"Celú cestu, jak pôjdeme, budeš mať v ústach tenisovú loptičku."\r\nRóm sa začudoval a hovorí:\r\n"Hmmm. No dobre, ale ja žiadnu nemám. Máš mi dajakú požičiať?"\r\n"Jasné choď za auto a tam je v strede pri narazníku na ťažnom!"', 496, 3.28, 39),
	(9107, 'Policajt zastaví róma na bicykli. Róm má na chrbte veľký ruksak:\r\n"Čo je v tom ruksaku?"\r\n"Slama!"\r\nPolicajt otvorí ruksak a pozerá. Dnu je slama. Policajt:\r\n"Hej róm, ak tam niečo nájdem tak ťa zbijem."\r\nPolicajt prezerá ruksak a nič. Nahnevaný ho pustí ďalej. A róm si popod nos zašepká:\r\n"Tak takto sa kradnú horské bicykle."', 351, 3.77, 39),
	(9108, 'Ide cigán po meste a zrazu vidí nápis:\r\n"Domáci 100 Sk a s gumou, turisti 100 DM a s gumou, cigáni zadarmo a bez gumy."\r\nCigán celý nadržaný uteká až pribehne k bungee jumpingu...', 190, 3.54, 39),
	(9109, 'Spoluobčan sa sťažuje u lekára:\r\n- Pán dochtor, moje deti nejeďá klobásu, mäso, sladkosti, nyšt nejeďá...\r\n- A prečo?\r\n- Lebo nemáme, prosím pekne. ', 163, 3.47, 39),
	(9110, 'Policajt cigáňovi:\r\n"Dežo, doklady!"\r\n"Dyk móre, dočoho?!"', 63, 3.26, 39),
	(9111, 'Róm pred novinovým stánkom.\r\n"Toprý teň, máte Slovenku ?"\r\n"Slovenku nemáme. Vezmite si život."\r\n"Ta ty si fesmi šifot ty koza sprosta..."', 147, 3.42, 39),
	(9112, 'Príde Araňa za farárom, či by jej nemohol pokrstiť decko. Farár pozerá, dlho rozmýšľa a opýta sa:\r\n"A nechceš ho radšej obetovať?', 143, 3.46, 39),
	(9113, '"Sudca sa pýta róma. Obžalovaný pichol ste tu prítomného tri-krát nožom?"\r\n"Nie iba raz, ale vidlami."', 110, 3.42, 39),
	(9114, 'Pýta sa Araňa Deža.\r\n"Dežo, ta kde ideš?"\r\n"Na jahody."\r\n"Veď je zima!"\r\n"No a čo, šak mám sveter."', 108, 3.33, 39),
	(9115, 'V obci Veľká Ida bol cigánsky kráľ a žil tam aj tamojší gróf. Zašiel raz cigánsky kráľ za richtárom sťažovať sa na grófa. Richtár sa ho pýta čo ho doviedlo k nemu a cigáň hovorí, že sa ide sťažovať na pána grófa, že mu chodí za ženou Etelou. Richtár mu odpovedá choď aj ty za pani grófkou. Cigáň odpovedá, že aj on chodí.\r\n"Tak sa potom prečo sťažuješ."\r\n"No preto lebo pán gróf Etelu aj preťahuje."\r\n"Tak aj ty preťahuj pani grófku."\r\n"Veď ju aj preťahujem."\r\n"Tak sa prečo sťažuješ na pána grófa."\r\n"No preto lebo on mne robí cigáňov a ja jemu grófov."', 617, 3.32, 39),
	(9116, 'Cigáň si kúpi auto, ide s ním na výlet a zrazu dostane defekt. Chytí zdvihák, že ide vymeniť koleso. Dáva dolu to staré keď mu zrazu druhý cigáň rozbije kameňom sklo na okne a hovorí:\r\n"Ja si beriem autorádio,dobre!"', 234, 3.37, 39),
	(9117, 'Beží cigáň hore Važcom a za ním beží policajt. Vidí, že ho už nedobehne a tak kričí:\r\n- Počkaj cigáň! \r\nCigáň sa otočí a kričí naspäť:\r\n- Ty počkaj, teba nenaháňajú!', 193, 3.34, 39),
	(9118, 'Poľovník sa dal zmraziť na sto rokov. Po rozmražení prejavil záujem o dobrú poľovačku. \r\n"Najradšej na jeleňa."\r\n"Bohužial, tie však už boli len v učebniciach."\r\n"Tak by mohly byť aj jarabice."\r\n"Nebuď smiešny, tie vymreli medzi prvými.Tak na čo tu poľujete?"\r\n"No najlepšie je na cigáňov na Luníku IX."\r\nDobre, poľovník sa dá odviesť na L IX., postaví sa za kandeláber a čaká. Po chvíli sa v jednom z vchodov  objaví skupinka štyroch cigáňov, ktorý nesú vaňu. Po chvíľke sa rozbehli. Poľovník zamieri na pravého zadného a vystrelí. Pravý padne a ostatní sa zastavia a bezradne pozerajú okolo seba. Zrazu z vane vyskočí skin a zahreši: "Do... to je dnes už štvrtý defekt!"', 729, 3.38, 39),
	(9119, 'Dežo volá na majstra:\r\n-  Pán majster, polámala sa mi lopata. \r\n- Tak sa opieraj o bager.', 93, 3.49, 39),
	(9120, 'Čo vznikne z róma keď ho prejde parný valec?\r\nCD-róm.', 58, 3.36, 39),
	(9121, 'Prečo vyrábajú biele Fidorky?\r\nAby si cigáni neodkusli prsty.', 65, 3.45, 39),
	(9122, 'Na železničnej stanici spí Dežo na lavičke. Príde k nemu policajt a pýta sa ho: \r\n- Čo je toto nocľaháreň?\r\nDežo sa otočí na druhú stranu a zašomre: \r\n- Čo som ja informátor?', 192, 3.18, 39),
	(9123, '- Čo stále robíš, Dežo?\r\n- Duševne pracujem.\r\n- Neblázni!\r\n- No áno. V duchu si predstavujem prácu.', 108, 3.36, 39),
	(9124, '- Dežo, požičaj mi 100 korún.\r\n- Dobre, požičiam, ale od koho?', 68, 3.15, 39),
	(9125, 'Dežo, kedy mi vrátiš tých päťsto korún čo som ti požičal?\r\nA čo som ja prorok?', 89, 3.24, 39),
	(9126, 'OTÁZKA: Čo je to rómsky komunizmus?\r\nODPOVEĎ: Jeden nakradne a s ostatnými v rómskej osade sa spravodlivo rozdelí.  ', 123, 3.17, 39),
	(9127, 'Viete čo je najväčší paranormálny jav?\r\nCigán študujúci popri zamestnaní!', 83, 3.3, 39),
	(9128, '"Dežo, kde si bol včera večer?"\r\n"Ja som ho nezabil!"', 56, 4.03, 39),
	(9129, 'Cigáň ide pytliačiť a zastrelí jelena. Ako si ho tak nesie na pleci domov, zastaví ho ho policajt a pýta sa ho:\r\n- Čo to máš na pleci?\r\n- Psa, pán príslušník.\r\n- A čo tie parohy?\r\n- To je jeho problém, pán príslušník.', 237, 3.18, 39),
	(9130, 'Na Spiši:\r\nCigáň ide okolo roľníka, ktorý práve sadí zemiaky a pýta sa ho:\r\n- Tak čo, sadíte, sadíte?\r\nRoľník odpovedá:\r\n- Áno a teba čo je do toho!\r\nCigáň hovorí:\r\n- Ja nič, či len aj pre seba neposadíte!', 228, 3.13, 39),
	(9131, 'Róm si hľadá prácu. Už nemá ani na chleba, a nikto ho nechce zamestnať. Stretne farára a pýta sa ho či by pre neho niečo nemal. Farár sa nad ním zľutuje a dá mu prácu. Budeš sa mi starať o holuba. Budeš ho kŕmiť a čistiť mu obydlie. A keď ja budem slúžiť omšu, zdvihnem ruky a zaspievam:\r\n"Duchu svätý prileť k nám."\r\nTy z hora vypustíš holuba ako symbol ducha svätého. Róm sa vytešuje akú dobrú prácu si našiel. Až nastal čas. Omša v plnom prúde,keď farár zdvihne ruky a začne spievať:\r\n"Duchu svätý prileť k nám."\r\n"Nepriletí, zdochol nám".', 598, 4.01, 39),
	(9132, '"Cigán, kde pracuješ?"\r\n"V hladomorni."\r\n"A čo tam robíš?"\r\n"Šéfkuchára."', 81, 3.09, 39),
	(9133, 'Pýtajú sa Deža na odvode, aké detské choroby prekonal? Dežo hovorí:\r\n- Osýpky, záškrt a kvapavku.', 107, 2.79, 39),
	(9134, '"Cigán, čo robíš?"\r\n"Ako vždy, zase nič."\r\n"Tak ti pomôžem, chceš?"', 76, 3.13, 39),
	(9135, 'Cigáň pytliačil a zabil jeleňa.Nesie ho na chrbte a stretne policajta.\r\n"Čo to máte na chrbte?"\r\nCigáň sa obzrie a hovorí:\r\n"Dyk, jeleň a aký prítulný."', 165, 3.37, 39),
	(9136, 'Skín oslavuje narodeniny. Otec mu kúpil nového bombera, matka nové gladiátorky. Sestra ho volá, poď so mnou do garáže, mám pre teba prekvapenie. Prídu do garáže, a tam cigán v reťaziach. Skín sa veľmi pekne poďakuje, uštedrí mu ranu do brucha a vtom sa ozve:\r\n"Happy birthday to you!"', 304, 2.97, 39),
	(9137, 'Policajt: "Cigán doklady!"\r\nCigán   : "Do čoho pán policajt?"', 65, 3.04, 39),
	(9138, 'Ako sa povie rómska rafinérna spoločnosť?\r\nOil Of Olaz.', 59, 3.23, 39),
	(9139, 'Cigán stopuje a zastaví mu auto plné skínov. Nasleduje rozhovor: \r\n"Zveziete ma ?" \r\n"Pravdaže, ale budeš držať v ústach tenisovu loptičku" \r\n"Nedbám, a kde ju máte?" \r\n"Vzadu na guli."', 197, 3.32, 39),
	(9140, 'Dežo dobehne domov a kričí:\r\n- Arana, rýchlo zavri dvere!\r\nArana rýchlo zavrie dvere a teší sa, čo bude.\r\n- Arana rýchlo zastri záclony!\r\nArana rýchlo zastrie záclony a teší sa, čo bude.\r\n- Arana, rýchlo si pod ku mne lehnút!\r\nArana sa šuchne k Dežovi do postele a Dežo hovorí:\r\n- Dik, kukni, jaké mám svítiace hodzinky!', 344, 3.04, 39),
	(9141, 'Príde cigán domov a hovorí žene:\r\n"Dik, Araňa, neska ťa pomilujem po španielsky!"\r\nAraňa neváhala. Keď bolo po všetkom, Dežo sa otočí na druhý bok a zaspí. Araňa s ním začne triasť a hovorí:\r\n"Dik, ty gadžo, šak to bolo ako vždy a ty si hovoril, že to bude po španielsky!"\r\n"Jaj, zabudol som. O´LE!"', 326, 3.26, 39),
	(9142, '"Hej cigáň, poď sa s nami zahrať hru!"\r\n"A akú?"\r\n"Keď hodíme kockou čísla 1 - 5, dostaneš na hubu."\r\n"A keď hodíte 6?"\r\n"Hádžeš ešte raz!"', 155, 3.46, 39),
	(9143, 'Ako sa nazýva cigánske bojové umenie?\r\nDIG FU!', 49, 3.36, 39),
	(9144, 'Vošiel cigán do električky a dal si do úst žuvačku wriglies. Potom zdvihol hlavu a zbadal, že električka je plná skinheadov. A cigán si poznamenal:\r\n"To je smola. Ešte tak veľa chuti a už tak málo času."', 218, 3.21, 39),
	(9145, '"Hej, cigán, kde si bol včera?"\r\n"Ja som ho prosím nezabil."\r\n"A koho?"\r\n"Jéj, vy ste ho ešte nenašli?."', 110, 3.48, 39),
	(9146, 'Zápis z policajnej zápisnice:\r\nPo ulici išiel čestný a slušný Róm, vtom spoza rohu vybehol agresívny starček, napichol sa mu na nôž a vnútil mu svoju peňaženku.', 175, 3.48, 39),
	(9147, 'Ide cigáň po ceste a zrazu ho zastaví starý dedko, ktorý sa ho pýta:\r\n- Chlapče, to sa nehanbíš chodiť takto v otrhaných šatách a  taký špinavý?\r\n- A dedko, vy sa nehanbite chodiť po cigánskej osade pred ostatnými?', 233, 3.12, 39),
	(9148, 'Cigánka perie na brehu rieky prádlo, a na druhej strane si hádže skín žabky. Vytiahne z vody kameň a hodí žabku a na druhej strane trafí cigánku do hlavy a zabije ju. Cigán čo stál vedľa nej kričí na skína:\r\n"Hej skín, zabil si mi práčku."\r\n"Jó vodnej kámen to je prevít.', 295, 3.14, 39),
	(9149, 'Príde Dežo do pôrodnice a nakukne do prvých dverí s nápisom najkrajšie deti na svete. Tam sa pýta sestričky, či tam je Móricko, sestrička mu odpovie nie, Móricko tu nie je. Dežo ide do ďaľších dverí s nápisom pekné deti, ale Móricko nie je ani tam. Dežo už mierne napálený ide do ďaľších dverí s nápisom škaredé deti a vraví si no bude trošku škaredý ale je môj. Tam sa dozvie, že Móricko tam nie je tiež. Nakoniec ide do posledných dverí s nápisom morbidné deti a tam sa dozvie, že Móricko tam nie je. V tom Dežo zbadá úplne posledné dvere, príde k nim a na dverách vidí velikánsky nápis MÓRICKO.', 655, 3.13, 39),
	(9150, '- Araňa, požičaj sto korún.\r\n- Mám len päťdesiat.\r\n- Tak daj päťdesiat a päťdesiat mi budeš dlžná.', 112, 3.48, 39),
	(9151, '- Dežko, koľko vážiš?\r\n- 23 kg aj z okuliarmi.\r\n- A prečo aj z okuliarmi?\r\n- Lebo bez okuliarov na váhu nevidím!', 120, 3.27, 39),
	(9152, 'Kto má najväčšiu úctu k práci?\r\nRómovia. Ani sa jej nedotknú! ', 70, 3.98, 39),
	(9153, '- Dežo, počul som, že Ti zomrela žena.\r\n- Hej zomrela.\r\n- A na čo zomrela?\r\n- Ná však já nevím ani na čo žila!', 121, 3.53, 39),
	(9154, 'Raz sa tak stretnú američan, rus a slovák. Rus hovorí:\r\n- My máme toľko zbraní, že bi sme zničili Ameriku.\r\nAmeričan vraví:\r\n- To je nič. My ich máme toľko, že by sme zničili celý svet.\r\nA Slovák sa zasmeje a vraví:\r\n- My máme toľko cigáňov, ktorí vám to všetko pokradnú.', 298, 3.31, 39),
	(9155, 'Kde sa najviac prejavuje rómska iniciatíva?\r\nV pôrodniciach...', 65, 3.14, 39),
	(9156, 'Cigáň dostane byt. Príde za ním kamarát na návštevu a on sedí pri kúpelňových dverách a díva sa kľúčovou dierkou. \r\n- Čo to robíš?\r\n- Ticho, dívam sa na ženu!\r\n- A ty si ju ešte nevidel nahú?\r\n- Nahú áno, ale kúpať som ju ešte nikdy nevidel!', 269, 3.23, 39),
	(9157, '- Čuj dežo! Prečo nemáš rád zimu?\r\n- Lebo vtedy sa nedajú kopať zemiaky!', 80, 2.88, 39),
	(9158, '- Jano, hádaj, čo mám vo vrecku? Začína to na P.\r\n- Peniaze?\r\n- Nie, pollitrovku! A hádaj, čo mám v druhom vrecku? Začína to na E.\r\n- Deži, to naozaj neviem!\r\n- Ešte jednu!', 184, 3.58, 39),
	(9159, 'Pýta sa redaktor cigáňa. \r\n- No čo, knihy čítaš?\r\n- Čítam, čítam.\r\n- A o čom čítaš?\r\n- No rozprávky čítam.\r\n- A o tom, ako ide cigáň do roboty, nečítaš?\r\n- Nie, horrory nemám rád.', 204, 3.44, 39),
	(9160, 'Čo je najväčšia rarita na Slovensku? Vidieť pracujúceho róma, ktorý študuje popri zamestnaní, aby sa postaral o svoju bezdetnú manželku.', 148, 3.51, 39),
	(9161, 'Dežo leží na ceste a policajti sa ho pýtajú, čo sa mu stalo.\r\n- Zrazilo ma to na zem. \r\n- A zapamätali ste si značku? \r\n- Samozrejme, jablčné dezertné.', 162, 3.29, 39),
	(9162, '- Cigáň, kam ideš?\r\n- Veď som nič neukradol.', 49, 3.15, 39),
	(9163, 'Dežo si 20 rokov odkladá trištvrte výplaty z bane a po 20-tich rokoch si kúpi Meďák. Tak už si to šoféruje po rodnej cigánskej osade keď zrazu dostene defekt. Tak zastaví, a hľadá v kufri rezervu. Ide okolo jeho kamoš, tiež Dežo, a hovorí:\r\n"Dežo, čo to robíš?"\r\n"Ááále, vyberám rezervu."\r\nTak kamoš nelení, rozmláti okno a hovorí:\r\n"No dobre, tak kým ty vyberieš rezervu, tak ja zatiaľ vyberiem rádio."', 438, 3.13, 39),
	(9164, 'Dežinko príde domov z prvej triedy a chváli sa ockovi:\r\n- Oci, dnes som v škole vedel, koľko je 2x2. To preto, že som róm?\r\n- Nie, odpovedá otec, to preto, že si inteligentný.\r\nNa druhý deň príde dežinko domov zo školy a chváli sa ockovi:\r\n- Oci, dnes sme si s chlapcami na záchode merali pipíka a ja som mal najväčší. To preto, že som inteligentný?\r\n- Nie, odpovedá otec, to preto, že máš 17 rokov.', 427, 3.35, 39),
	(9165, 'Sedí partia cigánov nad sudom metylalkoholu a jeden zrazu prerečie:\r\n"Sakra, chlapi, poďme domov, nejako sa stmieva."', 121, 3.06, 39),
	(9166, '- Cigáň, kde robíš?\r\n- V elektrárni.\r\n- A čo tam robíš?\r\n- Kladiem odpor!', 81, 3.52, 39),
	(9167, 'Ako sa po cigánsky povie ďaleko?\r\nHelsinky.', 45, 3.57, 39),
	(9169, 'Dežo u lekára:\r\n- Pán doktor, zistil som, že sa zmenšujem!\r\n- Čože? Ako je to možné?\r\n- Viete, pán doktor, na moju váhu by som mal byť o 15 cm vyšší.', 164, 3.75, 39),
	(9170, 'Dežo dostal za úlohu robiť čiary na železnici. Prvý deň urobil 500 metrov čiary, druhý deň 300 metrov a tretí deň už len 30 metrov. Vedúci sa ho pýta:\r\n"Ako to Dežo, ze čím dlhšie robíš, tým kratšie čiary kreslíš?"\r\n"Majstre, keď to vedro je potom tak ďaleko."', 288, 3.09, 39),
	(9171, 'Príde cigánka do obchodu a pýta si cigarety.\r\nPredavačka sa jej pýta:\r\n- Aké?   \r\n- Dig, aka zvedavá.', 108, 3.47, 39),
	(9172, 'Cigáň si robí autoškolu. Prejde v poriadku križovatkou a inštruktor sa ho pýta: \r\n- Iba tak pre zaujímavosť, aká tam bola značka?\r\nA cigáň: \r\n- Hliníková, vrátime sa?', 182, 3.71, 39),
	(9173, 'Cigáň a policajt cestujú lietadlom. Príde k ním letuška a podáva im jedálny lístok. Policajt vraví:\r\n- Ja si dám cigánsku pečienku.\r\nCigáň sa naštve a povie:\r\n- No dovoľte, tak ja si dám policajta na vajíčkach!', 230, 3.26, 39),
	(9174, 'Muž na drahom aute zastaví na križovatke. Kým čaká na zelenú, pozerá na troch rómov, ktorí kopú vedľa cesty. Jeden z nich sa ozve:\r\n- Čho čhumíš, ghádžo. Keby si sa lhepšie učhil, mohol si khopať s nami!', 224, 3.64, 39),
	(9175, 'Dežo kradne drevo. Chytí ho policajt a pýta sa ho:\r\n- Na čo ti je toľko dreva?\r\n- Pre kravy!\r\n- A odkedy žerú kravy drevo?\r\n- Čo nezožerú, popálim!', 158, 3.09, 39),
	(9176, 'Príde policajt za Deziderom:\r\n- Dežo, kde si bol včera večer?\r\n- Ja som ho nezabil, pán policajt.\r\n- A čo ten nožík?\r\n- To nie s tým.\r\n- A potom si ho hodil do potoka.\r\n- Joj, vy ste ho ešte nenašli?', 210, 2.93, 39),
	(9177, '"Cigán, kde si bol včera večer?"\r\n"Ja som ho nezabil!"', 57, 3.07, 39),
	(9178, 'Dežo umýva svoje decko v lavóre, keď za ním príde jeho žena:\r\n- Čo plákaš to dzecko len tak za uši?! Šak ho chyť porádne!\r\n- Na čo si mám ruky obariť?', 167, 3.16, 39),
	(9179, 'Cigáň sa pobije s bielym. Keď príde na miesto čínu polícia, začne sa pýtať:\r\n- Tak, kto začal?\r\nCigáň odpovie:\r\n- On, on začal, nechcel mi dať peňaženku!', 170, 3.21, 39),
	(9180, 'Dežo bije ženu.\r\n"Dežo a za čo?"\r\n"To keby som vedel tak ťa zabijem."', 74, 3.45, 39),
	(9181, 'Cigáň na prehliadke u kožného.\r\n- No, Deži, nepoteším ťa, -hovorí doktor, - máš AIDS!\r\n- Vidia pán doktor, ani na vlastnú mater sa človek dnes nemôže spoľahnúť! ', 180, 3.14, 39),
	(9182, 'Na súde sa pýta sudca obžalovaného róma: \r\n- Pán Dezider, prečo ste tomuto mužovi zobrali peňaženku? \r\n- Aby sa ňou náhodou nezastrelil. \r\n- A prečo by sa ňou mal zastreliť? \r\n- Bola nabitá.', 206, 3.19, 39),
	(9183, 'Gejza vidí Deža ako beží s kufrom, tak sa ho pýta: \r\n- Deži, čo máš v tom kufri? \r\n- Ešte neviem.', 107, 3.35, 39),
	(9184, 'Ide chlap po ulici a na tričku \r\n"Nemám rád cigánov."\r\nZ krčmy vyjde chlap a kričí:\r\n"Hej, čo to máš na tričku ?" \r\n"To je prvá vec, čo ma na vás sere, že neviete čítať." \r\nCigán na to:\r\n"Hej, poď za roh!" \r\n"To je druhá vec, že sa chcete hneď biť." \r\nIdú za roh, cigán vytiahne nôž a chlap na neho:\r\n"A to je tretia vec, čo ma žerie, že ťaháte nože, keď sa bude strielať!"', 409, 3.59, 39),
	(9185, 'Ide cigánka s deckom po tržnici:\r\n- Mamo, kúp mi cibuľu.\r\n- Hej, dobrotky by si jedol.', 90, 3.17, 39),
	(9186, 'Roľník sadí zemiaky a róm sa pýta:\r\n- Tak čo sused, sadíte, sadíte?\r\n- Áno.\r\n- Tak viac nasaďte, aby aj vám ostalo.', 126, 3.22, 39),
	(9187, 'Zastaví policajt starší rómsky párik a tí sa mu hneď sťažujú. \r\n- Pán policajt, všade tu panuje obrovský strach. Tuto Aranka práve okradla nejakého cudzinca a bojí sa to ohlásiť!', 196, 2.75, 39),
	(9188, 'Kradnú dve rómky cukrovú repu na poli. Zrazu jedna vytiahne zo zeme obrovskú repu a skríkne:\r\n- Mara, šak táto je ako môjho starého vták!\r\n- Neblázni, nevedela som, že ho má taký veľký.\r\n- Čoby taký veľký. Taky špinavý!', 241, 3.18, 39),
	(9189, '"Dežo keľo hodin?"\r\n"Desať desať."\r\n"Ďakujem, ďakujem."', 61, 3.31, 39),
	(9190, 'Dežo si nesie cez les fúru dreva, ale z diaľky ho vidí polesný. Na druhý deň príde polesný za dežom a hovorí: \r\n- Dežo, kde máš to drevo, čo si včera niesol cez les?\r\n- Náá šak ja nemám nijaké drevo. \r\n- Ale ja som ťa včera videl, nože poďme na pôjd.\r\nNa pôjde veľká kopa už nasekaného dreva.\r\n- Dežo a toto je čo?\r\n- Dyg more, čo tie lastovičky všetko nenanosia.', 399, 3.42, 39),
	(9191, 'Mladá neskúsená cigánka sa vydáva, a tak sa pýta matky: \r\n"Mama, čo mám vlastne robiť počas svadobnej  noci?"\r\n"Nič sa neboj, dcéra moja, Deži Ti dá to, čo má najradšej, tam, kde Ty cikáš!!" \r\nDcéra rozmýšla, a hovorí: \r\n"Ale mama, prečo by dával adidasky do drezu??!"', 293, 3.43, 39),
	(9192, 'Šesť cigáňov ide vo vlaku a príde revízor. Pýta si lístky, ale dajú mu ich ibapäť. Revízor hovorí:\r\n- Dali ste mi iba päť a vás je tu šesť! \r\n- Však šesť - odpovie cigáň. \r\n- Ale vás je tu šesť a dali ste mi päť. \r\n- Však päť. \r\n- Ale to znamená, že jeden ide načierno. \r\n- Však to. ', 318, 3.18, 39),
	(9193, 'Na námestí v Bruseli vypukli nepokoje. Bili sa  Flámi s Valónmi. Začala strkanica a polícia dostala príkaz nepokoje rozohnat. Nedarilo sa im to, až jeden policajt vytiahol pištol, vystrelil do vzduchu a kričí:\r\n"Flámi napravo, Valóni naľavo."\r\nĽudia sa rozišli, ako im bolo nariadené, len v strede zostala kopa ľudí a ich hovorca Dežo hovorí:\r\n"Prosím pekne a my Belgičania kde máme ísť!?"', 415, 3.2, 39),
	(9194, 'Príde Róm do reštaurácie a hovorí:\r\n"Jeden guláš, rožok a pivo!"\r\nDonesú mu to.  Zie a chce ďalšie.\r\nKeď už zie asi 10 chce platiť a čašník sa ho pýta:\r\n"Dobre, čo ste mali?"\r\n"Guláš, rožok, pivo, guláš, rožok, pivo, guláš, rožok, pivo, gu..."\r\n"Dobre, dobre, nie som hluchý."', 305, 3.3, 39),
	(9195, 'Ide Dežo po púšti a zrazu na neho niekto kričí z vrtuľníka:\r\n- Dežo, kam ideš?\r\n- K moru. \r\n- Ale veď to je ešte 2 000 kilometrov!\r\n- Tak tomu hovorím pláž.', 170, 3.26, 39),
	(9196, 'V krčme bola vražda. Hlavný podozrivý cigán vysvetľuje:\r\n"Prídem do krčmy. Sadnem k stolu chrbtom k dverám. Vyberiem chlieb, slaninu a nôž, že idem jesť. Nôž si opriem o stôl čepeľou hore. Poškodený, prosím pekne, otvorí dvere, podkne sa na prahu a napichne sa mi na nôž. Prosím pekne a to sa opakovalo osem krát."', 340, 3.25, 39),
	(9197, 'Príde cigáň neskoro do roboty a jeho šéf ho už čaka, klepká si na hodinky a hovorí:\r\n- Sedem pedesiat!\r\nA cigáň mu odpovie:\r\n- Také lacné?', 151, 3.34, 39),
	(9198, 'Cigáň stojí pred zrkadlom, obzerá si mužskú ozdobu a hovorí Arane: \r\n"Aranka, kukaj. Keby som mal o 1cm väčší, tak som král!"\r\nArana na neho pozrie a hovorí:\r\n"Dežko a keby si mal o 1cm menší, tak si kráľovná!"', 229, 3.3, 39),
	(9199, 'Sadí chlapík bandurky a Dežo mu hovorí:\r\n- Sadzice, sadzice?\r\n- Hej sadzim, a tebe co do teho?\r\n- Ja nič, len kukám, že pre sebe neposadzice?', 148, 2.94, 39),
	(9200, 'Dvaja malý rómovia nájdu samopal. Jeden z nich hovorí:\r\n- Dik more, to je saxofón! Ja budem fúkať a ty stláčaj!', 120, 3.5, 39),
	(9201, 'Cigáň hovorí druhému:\r\n- Počúvaj, Dežo, predám ti orechovu spálňu.\r\n- Orechovú, hej? A za koľko?\r\n- Za 500 korůn!\r\n- Nevrav, orechovú spálňu za 500 korún? Šak to beriem!\r\nKeď prídu domov, cigáň otvorí dvere a volá:\r\n- Orech, vylez! Predal som ti spálňu.', 279, 2.98, 39),
	(9202, 'Zastavia policajti cigáňa na aute a hovoria mu.\r\n- Cigáň doklady! \r\n- Dočoho?\r\n- Ty si ale primitív!\r\n- Pričom? ', 119, 3.21, 39),
	(9203, 'Stretne Hedviga Araňu a pýta sa jej:\r\n- Dik kde ideš Aranka?\r\n- Dik na ples.\r\n- A načo tam neseš decko?\r\n- Na šak ho dám do tomboly!', 139, 3.49, 39),
	(9204, 'Dvaja skinheadi prídu k rómskemu príbytku. Jeden drží besaballku a druhý kanister s benzínom. Dežo otvorí dvere a kričí: \r\n"Araňaaa idú ti kúpači!"', 162, 3.56, 39),
	(9205, '"Deži, kedy si sa narodil?"\r\n"1.mája koncom mesiaca."', 55, 3.83, 39),
	(9206, 'Príde cigáň do videopožičovne a pýta sa:\r\n- Máte film Cigáni idú do neba? \r\n- Nie, ale máme film Cigáni idú do práce!\r\n- Jooooj, ja horory nerád pozerám!', 168, 3.24, 39),
	(9207, 'Dežo hovorí Aladárovi:\r\n- Ty to máš dobré. Keď sa rozvedieš, stratíš ženu, ale sestra ti zostane.', 108, 2.69, 39),
	(9208, 'Príde cigánka po niekoľkých rokoch do kostola na spoveď, vlezie do spovedelnice a hovorí:\r\n- Boha, jaká je tu tma!\r\nA z poza závesu jej farár hovorí:\r\n- Duša moja, ale tu sa nesmie hrešiť!\r\nCigánka na to:\r\n- Kurva, jak som sa vás zlakla!', 252, 3.38, 39),
	(9209, 'Aký je to polomŕtvy pes?\r\nJednou nohou v guláši.', 52, 3.12, 39),
	(9210, 'Pýta sa policajt cigáňa:\r\n- Dežo, kde bývaš?\r\n- Nepoviem.\r\n- Dežo, kde bývaš?\r\n- Nepoviem.\r\n- Dežo, bedňa horí!\r\n- Jaaj môj dom.', 141, 2.98, 39),
	(9211, 'Rozprávajú sa dvaja cigáni a jeden hovorí:\r\n- Dežo, požičaj mi motorku.\r\n- Nepožičiam, nemám benzín.\r\n- Požičaj mi motorku. Prosím.\r\n- Nemám benzín.\r\n- Dežo, idú skíni!\r\n- Nasadaj, padáme.', 208, 3.49, 39),
	(9212, 'Cigán má už dvanásť detí, viac ako dosť, a tak hľadá radu u doktora. Príde domov, schmatne Aranu, vyvedie na dvor, šmarí ju do snehu, vyhrnie sukňu a začne si dovoľovať. \r\n- Nerob! Veď máme detí plný dom!\r\n- Ty len čuš! Ak vojdeš do domu opäť otehotnieš. Dobre mi doktor hovoril. Zakončuj vždy vonku...', 330, 3.52, 39),
	(9213, 'Malé cigánča vojde do stodoly a vidí ako tato leží na mame a trasie sa a trasie. \r\n- Dik more, čo to robite?\r\n- Vypadni a nezavadzaj, mama je chorá tak ju liečim.\r\nNa druhý deň príde cigán domov a na dvore sa pýta decka, kde má mamu.\r\n- V kuchyni. Sused ju lieči, asi ju trochu bolí hrdlo...', 308, 3.52, 39),
	(9214, 'Pristihnú policajti cigána ako kradne, zbijú ho tak, že nezodpovedá fotke v občianke a na druhý deň ho postavia pred súd.\r\n- Počul som, že si všetko priznal, - začína sudca\r\n- Vaša ctihodnosť, bolo to vynútené priznanie, lebo policajti ma bili.\r\n- Občan, dnes polícia nikoho nebije!\r\n- Dnes možno nie, ale včera ma zmlátili ako vrece žita...', 365, 3.07, 39),
	(9215, 'Cigánka v trafike:\r\n- Jednu Slovenku!\r\n- Nemáme. Vezmite si Život.\r\n- Ty si vezmi život, ty krava.', 102, 3.39, 39),
	(9216, 'Dežo bol pytlačiť v lese a s jeleňom na chrbáte sa vracia do osady. Cestou ho zastaví policajná hliadka.\r\n- Dežo, kde si bol? - pýta sa policajt.\r\n- Na prechádzke.\r\n- A čo to máš na chrbte?\r\nDežo sa obzrie a hovorí: \r\n- Dik jeleň a aký prítulný.', 264, 3.48, 39),
	(9217, 'Príde rómka na železničnú stanicu a v pokladni si pýta lístok.\r\n- Kam to bude, prosím? - pýta sa pokladníčka.\r\n- Dik jaká zvedavá.', 143, 3.59, 39),
	(9218, 'Stretnú sa dvaja cigáni.\r\n- Nazdar Dežo. Ta dze idzeš? \r\n- Ale, idzem sebe kupic do obchodného domu kabát. \r\n- Vážne? Ta znáš čo? Kedz ce neulapia, ta kúp aj mne!', 174, 3.29, 39),
	(9219, 'Ide cigáň po ulici a nájde zips, zodvihne ho a hovorí:\r\n"Dik ešte rifle a som frajer!"', 91, 3.8, 39),
	(9220, 'Cigán lúšti krížovku a premýšľa:\r\n"Čierny dravý vták, na tri písmená?"\r\nPozrie sa dolu a napíše:\r\n"Môj"', 119, 3.44, 39),
	(9221, 'Dežo, ako veľký výpalník príde do zlatníctva s tým, že si kúpi krížik na retiazku. \r\n- Prosím vás, počom máte ten krížik ?\r\n- 6000 korún.\r\n- Aha... a bez toho atléta?', 186, 3.15, 39),
	(9222, '- Ako robí krava? \r\n- Mú. \r\n- A ako robí pes? \r\n- Hav. \r\n- A ako robí cigáň? \r\n- Cigáň nerobí.', 103, 3.44, 39),
	(9223, '- Dežo, kde bývaš?\r\n- V chladničke.\r\n- A nie je ti tam zima?\r\n- Nie, zatváram si dvere.', 92, 3.13, 39),
	(9224, 'Príde malý cigánik domov celý špinavý. Keď ho mamka zbadá, hneď ho pošle do kúpeľne umyť sa. Umýva sa cigánik hodinu, dve a po tých dvoch hodinách kričí mamke:\r\n- Mami, už zišla ročná špina.\r\nMamka sa naňho pozrie a povie mu, aby sa umýval ďalej. Umýva sa cigánik ďalšiu hodinu a po tej hodine sa ozve mamke:\r\n- Mami, už zišla dvojročná špina.\r\nMamka mu opäť povie, aby sa umýval ďalej. Umýva sa cigánik ďalšie dve hodiny a po dvoch hodinách kričí mamke.\r\n- Mami, už vidno sveter.', 528, 3.65, 39),
	(9225, 'Jeden naš spoluobčan tmavšej pleti šiel k lekárovi a pri vyšetrení sa sťažoval čo ho bolí.....chrbát, boky, nohy, ruky, krk, hlava - skrátka všetko. A keď sa ho lekár pýtal od čoho to asi má, tak že od ťažkej roboty - od nosenia uhlia po schodoch do pivnice. A na otázku od kedy tak ťažko robí ...občan odpovedal:\r\n"Od ZAJTRA pán doktor!"', 366, 2.89, 39),
	(9226, 'Príde cigánka ku gynekológovi a hovorí mu:pán doktor ja som asi tehotná a doktor jej na to povie,že nie že to je len brušný náfuk.\r\nPríde druhy krát a zopakuje sa to isté.\r\nNa tretí krát príde s manželom a doktor jej zasa\r\npovie že to je len brušný náfuk a tu s ozve cigáň \r\na hovori a čo si myslíte že môj penis kompresor?     ', 356, 3.53, 39),
	(9227, 'Viete prečo vyrábajú biele fidorky?:\r\nAby si cigán neodhryzol prsty', 71, 3.38, 39),
	(9228, 'Motto rómskej olympiády: Nie je dôležité zvíťaziť, ale vrátiť športové náradie.', 92, 3.56, 39),
	(9229, 'Vieš ako sa povie rómovi v obleku?\r\nObžalovaný vstante.', 59, 3.58, 39),
	(9230, 'Cigánka porodila malého cigána. Stretne ju susedka a hovori:dobrý deň akého máte pekného syna. Ako sa volá? Jožko digital. Susedka sa pýta prečo Jožko digital? Cigánka hovorí:Jožko po otcovi a digital, lebo nemá ručičky.', 239, 3.58, 39),
	(9231, 'Viete prečo blchy a vši nesvietia?\r\nLebo večer v rómskej osade by to vyzeralo jak LAS VEGAS.', 96, 3.78, 39),
	(9232, 'Cigán sadí zemiaky.', 21, 3.64, 39),
	(9233, 'Čo sa stane s rómom keď ho prejde parný valec?\r\n?????\r\nCD-rom', 65, 3.4, 39),
	(9234, 'Viete prečo cigáni neprdia? lebo by sme všetci zomreli...\r\n', 62, 3.08, 39),
	(9235, '-Prečo majú cigáni špinavo?\r\n-???\r\n-Lebo Mr.Proper je skinhead!\r\n\n', 70, 3.35, 39),
	(9236, '-Dežo, zahreš!\r\n-Robota!', 26, 3.54, 39),
	(9237, 'Cigáni sa rozprávajú na námestí:\r\n- Dežo, bež sa opýtať tej paní, koľko je hodín. A hlavne,nezabudni na kabelku!', 124, 3.47, 39),
	(9238, 'Viete aké sú štyri najhoršie slová, ktoré Vám môže povedať cigáň?\r\n- Som tvoj nový sused.', 102, 3.49, 39),
	(9239, 'Róm chytil zlatú rybku a tá mu hovorí, že keď ju nechá žiť, tak mu splní tri priania. Róm si želá, aby bol biely.  Prepláva k druhému brehu a späť a je biely. Druhé želanie je, aby aj jeho manželka bola biela, a tak manželka prepláva k druhému brehu a späť a je biela. Tretie prianie je, aby aj jeho 10 detí bolo bielych. A tak deti preplávali na druhý breh a v polovičke cesty späť, keď už nevládzu, zakričia na otca:,"Tati, poď nás zachrániť." A otec im na to: "Rómom nepomáham!!!"', 524, 3.72, 39),
	(9240, 'Aký je rozdiel medzi trampolínou a cigánom???\r\n\nPo trampolíne sa neskáče v kanadách.', 91, 3.99, 39),
	(9241, '- Ako sa povie tisíc rómskych obyvateľov na štyri písmená???\r\n\r\n- MÁLO!!!', 80, 2.96, 39),
	(9242, 'OTÁZKA: - Viete, aká je to cigánska Barbie?  \r\nODPOVEĎ: - Je to sada, ktorá obsahuje jednu Barbie a 12 detí s podporou.            ', 137, 3.54, 39),
	(9243, 'Idu dvaja rómovia po lese a zrazu zbadajú kostru. Jeden sa pýta druhého, že asi akému zvieraťu patrí. Jeden hovori, že to bude jeleň, lebo kostra má parohy. Druhý na to, že to bude medveď, lebo ma veľké "pedále". Keď sa tak nevedia dohodnúť, zbadajú horára na obchôdzke, tak ho zastavia a hovoria mu.\r\nPán horár, vy ste odborník. Čo myslite z čoho je to kostra?\r\nHorár sa pozrie a odpovedá: "No podľa mňa z bicykla." ', 449, 3.5, 39),
	(9244, 'Cigáň a cigánka sa rozvádzajú. Sudca sa pýta cigánky na dôvod rozvodu a tá mu hovorí:"Na, pol roka som nemala v hube mäso." Nato cigáň vyskočí a hovorí: "A čo je môj penis, zelenina?!"', 202, 3.67, 39),
	(9245, 'Ide róm po ceste stretne druhého róma, ktorý sa začne strašne smiať. Róm sa pýta: Čo sa tak smeješ? Veď som pekne učesaný, umytý, košieľku mám vyžehlenú, tak na čom sa smeješ??Toto všetko máš, ale pipík ti trčí.', 239, 2.7, 39),
	(9246, 'Ide cigáň po ceste a ťahá za sebou povraz. Ide okolo neho policajt a ten sa ho pýta: "Cigáň načo vlečieš za sebou ten povraz?" Cigáň mu odpovedá: "A čo som sprostý, že ho budem tlačiť?!"', 204, 3.8, 39),
	(9247, 'Príde cigáň do drogérie a hovorí: \r\n"Tá voňavka sa volá tak ako ja." Predavačka nechápavo pozerá na cigáňa a ten jej hovorí: \r\n"Podajte mi tú voňavku, čo sa volá tak ako ja."\r\n"Vy sa voláte Hugo Boss?"\r\n"Nie, dežodorant..."', 243, 3.85, 39),
	(9248, 'Rus a cigáň uzavrú stávku, kto z nich dokáže preskočiť kostol. Ide rus, nepreskočí a povie: "Do riti." Z kostola vyjde farár a povie mu: "Pred kostolom sa nehreší." Ide cigáň, preskočí, z kostola vyjde farár a povie: "Do pi.., on to urobil."', 259, 3.5, 39),
	(9249, '- Čo urobí cigán, keď dokončí vysokú školu???\r\n- ...\r\n- Presunie lešenie na inú budovu...', 99, 3.71, 39),
	(9250, 'Dežo číta v novinách: Polícia hľadá muža vo veku asi 40 rokov, ktorý v noci na opustených miestach ukazuje ženám svoje prirodzenie. \r\n- Ej počúvaj Araňa, myslíš že by ma vzali?', 194, 3.39, 39),
	(9251, 'Ide skinhead po ulici a na tričku má napísané: Nenávidím rómov. Okolo neho ide opitý róm a skinhead sa mu prihovorí: "Prvá vec, ktorú na vás nenávidím je, že ste stále ožratí".Róm sa ho pýta, čo má napísané na tričku. Skinhead mu odpovedá, že tam má napísané, že neznáša rómov. "Druhá vec,ktorú na vás nenávidím je, že neviete čítať".Róm sa naštve a vytiahne nôž."Tretia vec, ktorú na vás nenávidím je, že vždy vyťahujete nôž tam kde sa bude strieľať."', 511, 4.11, 39),
	(9252, '- Aký je rozdiel medzi rómskou svadbou a rómskym pohrebom?br />- Na rómskom pohrebe je o jedného róma menej.', 114, 3.6, 39),
	(9253, 'Ide cigáň po púšti a stretne hada. Had mu hovorí: "Nezabíjaj ma, splním ti tri želania." Cigáň mu hovorí: "Chcem byť pekný, chcem byť biely a chcem mať krídla. A had nato: "Čari mari hadia nôžka, nech je s teba always vložka."', 246, 3.9, 39),
	(9254, 'Dežo zastrelil jeleňa a nesie ho domov. Po ceste ho stretne horár.\r\n- Dežo, čo to nesieš?\r\n- Psa.\r\n- Hééj? A čo tie parohy.\r\n- Jeho problém.', 150, 3.35, 39),
	(9255, 'Keď Kristus opúšťal svet, povedal cigáňom: \r\n"Nič nerobte, kým sa nevrátim"... a oni ho dodnes počúvajú.', 116, 4.09, 39),
	(9256, 'V škole dá učiteľka deťom úlohu, aby povedali príbeh, ktorý skončí vetou: "Mama je len jedna!". Prihlási sa Anička, známa bifľoška a vraví:\r\n- Vždy, keď idem ráno do školy, moja mama ma učeše, aby som bola pekná. Moja mama je veľmi dobrá. Mama je len jedna!\r\nPrihlási sa Jožinko a vraví:\r\n- Moja mama mi každý deň urobí do školy desiatu, aby som nebol hladný. Mama je len jedna!\r\nNakoniec sa prihlási Móricko:\r\n- Keď som včera prišiel domov, otvoril som dvere a náš byt bol plný dymu od cigariet, na koberci bol fľak od rozliateho červeného vína a mama sedela v obývačke rozčapená v kresle. Zakričala na mňa, aby som jej z chladničky doniesol dve fľaše piva. Otvoril som chladničku a zakričal: "Mama, je len jedna!"', 772, 4.26, 39),
	(9257, 'Nastupuje Arana do autobusu a šofér sa jej pýta: "Kam to bude?"A Arana nazlostená odpovedá: "Dig aký zvedavý."', 117, 3.91, 39),
	(9258, 'Stretnú sa dvaja Rómovia a jeden hovorí druhému: "Ja viem čo dostanem na Vianoce.""Hej? A čo?" On odpovie: "Tvoj bicykel."', 128, 3.64, 39),
	(9259, 'Viete prečo vši nesvietia? Lebo inak by Lunik IX vyzeral ako Las Vegas. ', 74, 3.98, 39),
	(9260, 'Zastavia policajti cigáňa. \r\n-"Cigáň, kam ideš?!"\r\n-"Teraz už nikam.., keď ste ma chytili."', 98, 3.29, 39),
	(9261, 'Cigáni obkľúčia skinheada a skinhead hovorí:"Viete čo na vás cigáňoch nenávidím? Po prvé vždy útočite v prevahe a po druhé vždy vyťahujete nože tam, kde sa bude strieľať."', 192, 3.77, 39),
	(9262, 'Príde majster Rómov a pýta sa Deža: "Dežo vidíš tu muchu na konci lešenia?"\r\nDežo: "Kde?"\r\nMajster: "Chlapci končíme, zlá viditeľnosť!" ', 150, 3.91, 39),
	(9263, 'Oproti sebe po ceste idú dvaja rómovia. Prvý sa pýta toho druhého: \r\n- Kam ideš? \r\n- Idem kúpať. \r\n- Koho? \r\n- sa.', 122, 3.31, 39),
	(9264, 'Príde róm do spovednice a pýta sa kňaza:\r\nRóm: Otče, ja som vám pred 20 rokmi niečo ukradol a chcel by som to vrátiť.\r\nKňaz: A čo?\r\nRóm : Keď som si vzal manželku, čaká pred spovednicou.', 203, 2.86, 39),
	(9265, 'Príde negramotná cigánka na úrad práce v novembri a podpíše sa xxx. V decembri sa tiež podpíše xxx, ale v januári sa podpíše ooo. - A to čo má byť Arana?- No, čo má byť, som sa vydala, nie?', 208, 3.45, 39),
	(9266, 'V cigánskej osade: "Dežo, povedz mi, čo čítaš, a ja ti poviem komu si tú knihu ukradol."', 95, 3.89, 39),
	(9267, 'Prečo vymysleli biele fidorky?\r\nAby aj rómovia mali špinavú hubu.\r\n', 71, 4.11, 39),
	(9268, 'Idu 2 cigánky ku gynekológovi.\r\nJedna vojde dnu, za 15 minút vyjde von a druhá sa jej pýta:\r\n- No, čo ti povedal?\r\n- Povedal, že vagína je v poriadku.\r\n- A na pi.. sa nepýtal ?\r\n- Nie, šak teba som nespomenula.', 220, 3.87, 39),
	(9269, 'Na mrakodrape sa stretli Američan, Francúz, Slovák a cigáň. Američan vyhodil doláre a povedal my ich máme dosť. Francúz vyhodil šampanské a povedal my ho máme dosť. Slovák vyhodil cigáňa a povedal my ich máme dosť.  ', 235, 3.84, 39),
	(9270, 'Prečo blchy a vši nesvietia?\r\nLebo potom by rómske osady vyzerali ako Las Vegas.', 83, 4.12, 39),
	(9271, 'Ide cigánka s deckom po tržnici: - Mamo, kúp mi cibuľu. - Hej, len dobrotky by si jedol. ', 93, 3.96, 39),
	(9272, 'Rus Američan a Slovák sa hádajú.Američan hovorí: "My máme toľko zbraní: že zničíme celý svet."Rus hovorí: "My máme toľko tankov, že zničíme celý svet."A Slovák hovorí: "My máme toľko cigáňov, že vám to všetko pokradnú."', 249, 4.03, 39),
	(9273, 'Ako sa hovorí cigáňovi v obleku?\r\nObžalovaný vstaňte...', 61, 4.17, 39),
	(9274, 'Pýta sa majster Deža na stavbe:\r\nM: Deži, vidíš totu muchu na konci lešenia?\r\nD: Ne, pán majster.\r\nM: Tak chlapci, balíme pre slabú viditeľnosť! ', 156, 4.23, 39),
	(9275, '- Cigáň, kde robíš???\r\n- Pri vysokej peci.\r\n- A čo tam robíš???\r\n- Hrejem sa.', 84, 3.84, 39),
	(9276, 'Viete aká je najlepšia žena pre cigáňa?\r\nSlepá, hluchá, bez čuchu a nymfomanka.', 87, 3.56, 39),
	(9277, 'Dvaja malí rómovia našli samopal.\r\n- Dig more, saxofón, ja budem fúkať a ty stláčaj!', 92, 3.35, 39),
	(9278, 'Prídu Fico, Mečiar a Kaliňák do škôlky a pýtajú sa malej Beátky: "Zaspievaš nám nejakú pesničku?"\r\n"Áno, takúto. Roľničky, roľničky zdraželi nám čižmičky, oteckovi alkohol, ktorý z vás to debil bol?"', 225, 3.77, 39),
	(9279, 'Mladá cigánka píše do časopisu Brava:\r\nMilé Bravíčko, mám 12 rokov a nie som tehotná,...Je môj otec dajako divný?', 125, 3.57, 39),
	(9280, 'Ide malý cigán po ulici a drží v ruke lyžičku. Na to mu z druhej strany kričí otec: "Zahoď to, to je semeno od lopaty!"', 128, 4.1, 39),
	(9281, 'Horí budova a jediným východiskom ako sa z nej dostať je skočiť zo strechy budovy do plachty, ktorú dole pripravili hasiči.\r\nAko prvý skáče biely. Hasiči ho chytia.\r\nDruhý skáče cigáň. Hasiči uhnú s plachtou.\r\nTretí skáče opäť cigán a hasiči znova uhnä s plachtou a nervózni kričia: "Tých spálených už dole NEHÁDŽTE!!!"', 354, 2.34, 39),
	(9282, 'Cigáň kupuje na železničnej stanici cestovný lístok...\r\n"Kam to chcete?" -  pýta sa pokladníčka.\r\n"Ta do ruky, ne?"', 124, 3.88, 39),
	(9283, 'Príde Dežo domov a načape Araňu v posteli so susedom. Rozzúrene vytiahne nožík z vrecka a ženie sa s ním na suseda.\r\nAraňa pohotovo vyskočí z postele a zachraňuje situáciu:\r\n- Dežo môj, počkaj, ja ti to vysvetlím!\r\n- Nemáme doma cigarety, nemáme pálenku, nemáme kávu. Tak čím som mala suseda pohostiť?!!', 329, 3.94, 39),
	(9284, 'Aký je najkratší vtip???\r\nCigán pracuje.', 44, 3.52, 39),
	(9285, 'Prečo róm nemôže byť vegetariánom?Pretože sójový pes neexistuje.', 73, 4, 39),
	(9286, 'Na Vašom mobilnom telefóne bola aktivovaná nová služba ROMING. Za každého mŕtveho Róma získavate 20 min volania zdarma. Úspešný lov praje Váš operátor.', 167, 3.66, 39),
	(9287, 'Viete prečo cigáni nemôžu mať preteky na bicykloch?\r\nLebo ľudia by si spoznali svoje bicykle.', 99, 3.81, 39),
	(9288, 'Viete ako húka Rómska sova?\r\n.......................\r\nDig more huuuuu.', 72, 3.75, 39),
	(9289, 'Mám dve správy. Jednu dobrú a druhú zlú. Zlá: Mám rómsku krv.Dobrá: Na prednej kapote môjho auta.', 107, 3.95, 39),
	(9290, 'Najhoršia veta, akú ti môže povedať cigáň je: "Dobrý deň sused."', 73, 4, 39),
	(9291, 'Dežo sa zamestná v stavebnej firme. Šéf mu prikáže natrieť okná.\r\nPo piatich hodinách práce sa vráti s otázkou: "Šéfe, a aj rámy?"...', 148, 3.74, 39),
	(9292, 'Malý černoško sa pýta Boha:\r\nPrečo si mi dal takú čiernu kožu?\r\nBoh na to:\r\nLebo bledá je velmi jemná na slnečné africké lúče.\r\nČernoško sa opäť opýta:\r\nA prečo mám také kratke kučeravé vlasy?\r\nBoh na to:\r\nPretože dlhé vlasy by sa ti zamotávali do afrických stromov. \r\nČernoško sa opäť pýta:\r\nTak prečo som sa potom narodil v Margečanoch?', 374, 4.03, 39),
	(9293, 'Idú dvaja cigáni do pizerie. Jeden hovorí: "Deži, jakú pizu si dáme.""Tá čo ja viem, ta takú najlacnejšiu.""Ta najlacnejšia je za 20 centov, môže byť?"Hej, jasné a jak sa volá, že pôjdem objednať.""Pizza krabica a popýtaj aj s majonézou."', 259, 3.7, 39),
	(9294, 'Pride Dežo za kamarátom a pýta sa ho.\r\nD: "Fero čo robíš?"\r\nF: "Nič nerobím"\r\nD: "Tak ti pomôžem.!', 108, 3.19, 39),
	(9295, 'Dvaja rómovia spadnú do vápna. Jeden sa pýta druhého:\r\n"Čo budeme teraz robiť?"\r\n"Ešte len minútu si biely a už by si chcel niečo robiť!"', 149, 3.98, 39),
	(9296, '- Viete čo je to maximálny optimizmus?\r\n- Stopujúci róm.', 60, 3.7, 39),
	(9297, '- Viete čo je jeden róm na mesiaci?\r\n- Nápad.\r\n- A čo sú všetci rómovia na mesiaci?\r\n- Riešenie.', 104, 3.82, 39),
	(9298, 'Idú traja rómovia okolo vodopádu a dohodnú sa, že každý skočí... Ide prvý a spieva si: „Poďme spolu lietať..“ – skočí, padne na ostrý kameň a zabije sa... Ide druhý a spieva si: „Pozri ja už letím..“ – skočí, padne na ostrý kameň a zabije sa.... Ide tretí a spieva si: „Keď sú dvaja šťastní, nechýba im tretí..“ - a ide domov.', 373, 4.12, 39),
	(9299, 'Viete prečo nemôžu isť rómovia na Tour de France?\r\n- Lebo diváci by si spoznali svoje bycikle.', 100, 4.15, 39),
	(9300, 'Sociálna pracovníčka na návšteve v rómskej rodine:\r\n- A vši nemáte?\r\n- Jój, nemáme, paninka, veru nemáme. Deti všetko pojedia.', 138, 3.67, 39),
	(9301, 'Róm: Kolik ti je? \r\nChlapec: 15.\r\nRóm: Nás taky! ', 52, 4.26, 39),
	(9302, 'Poľovník chytí Róma v lese ako kradne drevo. Poľovník sa ho pýta: „Počuj cigáň, prečo kradneš to drevo?“\r\nPán poľovník veď to nie je pre mňa, to mám ako krmivo pre zvieratá. \r\nPoľovník sa ho nato opýta: „Počuj cigáň a odkedy zvieratá žerú drevo?\r\nCigáň pohotovo odpovie: „No veď čo nezožerú tak to spálim.\r\n', 350, 4.18, 39),
	(9303, '- Fuj cigáň po čom smrdíš?\r\n- Ta po robote pan majster.\r\n- A čo robíš?\r\n- Hovno.', 88, 3.99, 39),
	(9304, 'Cigán kradne farárovi zemiaky.Ten ho prichytí a pýta sa ho:\r-Cigán prečo mi kradneš zemiaky?\r-Lebo sa mi chce...\r-Tak zajtra pridi znova a ja ti ich dám sám.\rCigán príde na druhý deň a farár mu vraví:\r-No a teraz sa prežehnaj.\r-V mene otca,i ducha svätého.Amen.\r-A syna si kde nechal?...\r-Ááále,šak vonku čaká s fúrikom na zemiaky.', 356, 4.1, 39),
	(9305, 'Rómska problematika sa dá vyriešiť športovo, napríklad vodným pólom.Cigáni budú mať červené čiapky a krokodíly modré.', 133, 3.84, 39),
	(9306, 'Cigáň kde robíš?\r\n- Ta v bani!\r\n- A čo tam robíš??\r\n- Banujem, banujem!', 78, 3.78, 39),
	(9307, 'Viete prečo je Rytmus najpredávanejším interpretom na Slovensku? Lebo jeho fanúšikovia si nevedia napáliť CD!', 117, 4.24, 39),
	(9308, 'Cigáni chytajú na rybníku ryby. Udice nahodené, podberáky pripravené. Po chvíli sa zjaví na starom bicykli porybný. "Zdravím páni,ako sa darí? Na čo chytáte ?"\r\n"Ta na vyprážanie "\r\n', 198, 3.32, 39),
	(9309, 'Dežo, kde robíš?\r\n- U brata.\r\n- A brat kde robi?\r\n- Zháňa robotu.\r\n', 72, 3.94, 39),
	(9310, 'Cigáň nájde na zemi zips a hovorí si: "Dig, ešte gate a som frajer."', 73, 4.1, 39),
	(9311, 'Príde cigán do krčmy a pýta sa : \r\n"Ako hrajú naši?" \r\nZo zadu sa len ozve:\r\n"Vaši nehrajú!" ', 101, 4.15, 39),
	(9312, 'Prečo si bezdomovec nepíše domáce úlohy?\r\n ???\r\n Lebo nemá domov.', 71, 3.79, 39),
	(9313, 'Viete prečo rómky zahubia celý svet??\r\n- Pretože majú čiernu dieru. ', 74, 3.36, 39),
	(9314, '- Viete prečo cigánky zahubia svet???\r\n- Lebo majú čiernu dieru.', 68, 3.61, 39),
	(9315, 'Do preplneného autobusu nastúpi parta mladých rómov a všetci si sadnú na jedno dvojsedadlo. Po chvíli jedna z cigánok kričí:\r\n"Ja som ešte panna, ja som ešte panna!"\r\nPo pol hodine cigáni vystupujú a cigánka kričí:\r\n"Ja som tehotná, ja som tehotná!"', 268, 3.33, 39),
	(9316, 'Rómovia, idú krstiť dieťa a pýtajú sa farára čo si majú priniesť.\r\nFarár im hovorí: "No, postačí nejaká malá dečka, košieľka a hlavne perinka a krstného otca a matku nezabudnite."\r\nNa druhý deň je krst a Rómovia idú do kostola. Majú perinku, dečku, košieľku, krstnú mamu a otca.. A farár sa ich pýta:\r\n"A decko ste kde nechali?"\r\nRómovia: "Šak dzecko ste nekazál..."', 400, 4.13, 39),
	(9317, 'Cikán obecný [Romus Vulgaris] - Noční živočich, příbuzný šimpanze. Má hnědé zbarvení, samička může mít světlou srst v oblasti hlavy. Bojí se vody a je charakterizován specifickým pachem. Původně stepní druh se přizpůsobil životu ve městech. Vyskytuje se po celém území ČR a SR. Je stěhovavý, někteří táhnou za potravou až za oceán. Samička rodí i několikrát do roka. Mláďata sají sociální dávky až do smrti. Cikán obecný loví kořist bezbrannou a na tu útočí v tlupách. Škodlivý, zákonem chráněný.', 562, 4.19, 39),
	(9318, 'Róm kradne zemiaky farárovi. Farár ho prichytí a hovorí mu: "Ak chceš zemiaky, príď zajtra aj s fúrikom."\r\nNa druhý deň príde róm za farárom na záhradu a farár mu hovorí: "Dobre, a teraz sa prežehnaj!"\r\nRóm: "V mene otca i ducha svätého amen."\r\nFarár: "A syna si kde nechal?"\r\nRóm: "Vonku čaká s fúrikom."', 331, 4.2, 39),
	(9319, 'Na veľkej budove vypukne požiar a jedinou možnosťou ako uniknúť, je skočiť do plachty. Požiarníci sa rozostúpia a čakajú. Vyskočí beloch - chytia ho. Vyskočí druhý beloch - chytia ho, ale keď vyskočí cigáň, tak sa uhnú. Vyskočí druhý - uhnú sa. Jeden požiarnik to nevydrží a zakričí hore:\r- Tých zhorených už nehádžte!', 356, 4.09, 39),
	(9320, 'Cigánka u doktora: Pán doktor ja tomu nerozumiem, ja som zdravá, môj brat je zdravý a deti mame jebnu*té...', 113, 4.17, 39),
	(9321, 'Milé Bravo, je mi 13, som rómka a ešte nie som tehotná, je môj brat buzerant?', 82, 3.93, 39),
	(9322, 'Ide cigáň s veľkou plazmou v rukách a okoloidúci Rytmus mu hovorí: "Si zabil."\r\nA cigáň mu na to hovorí: "Si nezamkol..."', 130, 4.16, 39),
	(9323, 'Najkratší vtip na svete:\r\nCigáň jedináčik.', 48, 4.08, 39),
	(9324, 'Rómske príslovie:     \rPes ktorý šteká, nie je uvarený.', 61, 4.16, 39),
	(9325, 'Správa dňa:\rZrútil sa Boing 747 plný rómov. Obidve rodiny smútia.', 71, 3.71, 39),
	(9326, 'Motto cigáňa: \r\nLen tri slová v srdci maj - kradni, ber a utekaj! ', 69, 3.89, 39),
	(9327, 'Cigáň sa chce stať vojakom. Príde na skúšky a kapitán sa ho pýta: Kto vyvolal 2. svetovú vojnu? \r\nCigáň: Hitler.\r\nKapitán: Kto bol po Hitlerovi?\r\nCigáň: Stalin. \r\nKapitán: Kedy sa začala 2. svetová vojna?\r\nCigáň: 1939. \r\nKeďže cigáň odpovedal dobre, prešiel skúškami a stal sa vojakom. Jeho kamarát chce byť tiež vojakom a pýta sa aké boli odpovede?\r\nCigáň mu hovorí: Hitler, Stalin a 1939 .\r\nPríde kamarát na skúšky a kapitán sa pýta: Ako sa voláš?\r\nKamarát: Hitler.\r\nKapitán: Ako sa volá tvoj otec?\r\nKamarát: Stalin.\r\nKapitán: A koľko máš bratov a sestier?\r\nKamarát: 1939.', 625, 4.1, 39),
	(9328, 'Viete akú majú cigáni navigáciu?\r\nJeden sedí v aute a druhý beží pred autom.', 84, 3.62, 39),
	(9329, 'Ide cigáň po lese a nesie niečo na pleci.\r\nZastaví ho poľovník a pýta sa ho:\r\n- Cigáň, čo to máš na pleci?\r\n- Dig jeleň, a jaký pritulný.', 152, 3.85, 39),
	(9330, 'Dežo chatrč ti horí!\r\n- Nemôže, kľúče mam pri sebe!', 59, 3.47, 39),
	(9331, 'Vezie sa veľkopodnikateľ na svojom džípe a zbadá pri ceste akéhosi somráka, ktorý dddychuje. Zrazu luskol prstami a pred ním sa objavila fľaška piva. Somrák ho vrazil do seba a pokračoval v oddychu. Veľkopodnikatela to zaujalo a tak zastavil a začal somráka pozorovať. Po chvílke somrák opäť luskol prstami a opäť sa zrazu objavilo pivo. Tak sa to niekoľko krát opakovalo. Veľkopodnikateľ to už nevydržal a obrátil sa na somráka:\r\n- Počuj, človeče, ako to robíš?\r\n- No... mám džina, ktorý plní moje želania - odvetí lenivo somrák.\r\n- Skutočného džina?! Predaj mi ho.\r\n- No, nemôžem ho predať. Ja ho sám potrebujem.\r\n- Pozri! Tu máš kľúče od môjho džipu, tu máš kľúče od mojej novej vily a tu je šek na milón. Predaj mi ho!\r\n- Tak to súhlasím.\r\nSomrák vzal kľúče a šek, vytiahol spod pazuchy starú lampu a dal ju veľkopodnikateľovi. Veľkopodnikatel utrel lampu, z nej vyletel džin a vraví:\r\n- Počúvam ťa, pán môj! Aké sú tvoje rozkazy?\r\n- Tak! Chcem nové auto, novú vilu, miliardu na účet a kontrolné balíky firiem Slovnaft, SPP...\r\n- Moment, pane môj! Neponáhľaj sa! - zastavil ho zázračný sluha,\r\n- Ja som úzko špecializovaný džin! Tak čo si dáš? Gambrinus, Kozel alebo Topvar?', 1281, 3.51, 40),
	(9332, 'Otázka: Na malom bielom podklade sedem malých dierok. Čo je to?\r\nOdpoveď: Panenská blana Snehulienky.\r\nOtázka:  Sedem malých a jedna väčšia?\r\nOdpoveď: Prišiel princ.\r\nOtázka:  Sedem malých, jedne väčšia a jedna najväčšia?\r\nOdpoveď: Prišiel na koni.', 270, 3.35, 40),
	(9333, 'V lese sa Červená Čiapočka stretne s Pinocchiom a obaja od radosti vystrájajú, naháňajú sa atď. Až sa Červena Čiapocka potkne, Pinnocchio padne cez ňu a čo čert nechcel nosom sa jej zavŕta pod sukienku.\r\n- Jeeej, prepáč, to som nehcel - práve tam... Rýchlo nos vytiahnem!\r\n- Nič sa nedeje! Nechaj. Radšej rýchlo povedz zopár klamstiev...', 362, 3.25, 40),
	(9334, 'Ide karkulka lesom a dostane ženské problémy. Pozerá na to celá zhrozená. Okolo ide vlk a pýta sa:\r\n- Čo sa ti stalo karkulka?\r\n- No, vieš, mne tu tečie krv a ja vôbec neviem čo to je.\r\nVlk na ňu pozerá a pýta sa:\r\n- Hej karkulka, neodtrhla si si náhodou čuráka?', 280, 3.51, 40),
	(9335, 'Žaba stretne princa v lese a hovorí:\r\n- Princ, pobozkaj ma a dačo dostaneš.\r\nPrinc sa zľakne a utečie. Na druhý deň ide do lesa zasa a znovu stretne žabu. Tá mu už nestihne nič povedať. Princ neváha a na tretí deň ide do lesa znovu. Vidí žabu, ale nezľakne sa jej a žaba hovorí:\r\n- Princ, pobozkaj ma a dačo dostaneš.\r\nPrinc už neváha a žabu pobozká. \r\n- Žaba, žaba a čo dostanem?\r\nA žaba na to: \r\n- Herpeeeeeezzzzzzzzzzz!', 453, 3.19, 40),
	(9336, 'Kubko a Maťko sedia pred salašom a fajčia cigaretku. Zrazu k ním zostúpi Boh a prisadne si k ním. Chvíľku len tak bafkajú a zrazu sa Maťko spýta:\r\n- A kto si ty?\r\n- Ja som Boh.\r\nA Kubko na to:\r\n- Dobrá, je dobrá.', 225, 3.2, 40),
	(9337, 'Mrázik ide po lese a stretne mladé dievča. Pýta sa ho:\r\n- Je ti zima, dievčatko?\r\nDievča odpovedá:\r\n- Čo ti šije, ty somár starý, to je vibrátor!', 157, 3, 40),
	(9338, 'Po niekoľko hodinovom namáhavom boji vraví princ Bajaja dvanásťhlavému drakovi.\r\n- Hej! Počúvaj ! Kde máš schovanú tú svoju silu?\r\n- Vo vajci... V kačacom ty idioooot !!!', 183, 3.31, 40),
	(9339, 'Príde rytier k jazeru a kedže je smädný, začne piť. O chvíľu priletí drak a začne piť vodu hneď vedľa rytiera. Rytier nelení, tasí svoj meč a odtne drakovi hlavu. Namiesto nej narastú drakovi tri nové hlavy. Tak rytier tne ďalej ale drakovi narastú za každú odťatú hlavu tri nové. Po chvíli už rytier nevládze a prestane, aby nabral dych. Vtedy sa ho drak pýta:\r\n- Hej rytier, čo si to vlastne chcel?\r\n- Napiť sa....\r\n- Tak prečo mi potom stínaš hlavy?', 486, 3.02, 40),
	(9340, 'Stretnú sa traja upíri a rozprávajú sa o tom, ktorý z nich je lepší. Prvý vyletí a o chvíľu sa vráti s krvavými ústami. Ostatní dvaja sa ho pýtajú:\r\n- No čo? \r\nOdpovedá:\r\n- Vidíte tam tú školu? Celú som ju vycucal.\r\n- Noo, dobrý.\r\nVyletí druhý a tento sa taktiež za chvíľu vráti s krvavými ústami. Taktiež sa ho opýtali, čo a ako. Ten im povedal, že vycucal celý vlak. Vyletí tretí upír a za tri minúty sa vráti späť s krvavými ústami. Pýtajú sa ho, čo a ako a tento hovorí: \r\n- Vidíte henten kostol?\r\n- Vidíme. \r\n- A vidíte hentú vežu? \r\n- Vidíme. \r\n- No ale ja som ju nevidel.', 634, 3.56, 40),
	(9341, 'Kde bolo tam bolo, bolo jedno kráľovstvo, kde žila mladá kráľovná. Muž jej krátko po svadbe zomrel a tak bola veľmi sexuchtivá. Kráľovský vojaci zajali cudzinca a predviedli ho pred kráľovnú a tá mu vraví.\r\n"Ak so mnou vydržíš 100 čísiel, si voľný, ale ak nie, dám ťa sťať.\r\n"Ak len toľko, nestrácajme čas a poďme na to."\r\nZačali sa milovať a kráľovná si každé číslo značila čiarkou nad posteľ. Keď sa už blížila stovka, kráľovnej nebolo stále dosť a tak začala vymazávať čiarky. Keď to cudzinec zbadal rozkričal sa.\r\n"Tak to teda nie, žiadne podvádzanie. Zmazať všetky čiarky a ideme odznova."', 659, 3.92, 40),
	(9342, 'Mikuláš hovorí vo svojej dielni škriatkovi: \r\n- Koľko máme hračiek? \r\n- Žiadne. \r\n- A počítal si ich vôbec? \r\n- Áno, dvakrát. ', 139, 3.26, 40),
	(9343, 'Sedí žaba na kameni a v dialke zbadá princa. Kričí na neho:\r\n- Princ, poď sem. Ak má pobozkáš, niečo dostaneš.\r\nPrinc neváha, príde k žabe a pobozká ju. Žaba na to:\r\n- Dostaneš ekzém!', 201, 3.07, 40),
	(9344, 'Ide Karkulka po lese a stretne vlka. A vlk sa pýta:\r\n- Kam ideš krava? \r\n- Ja nie som krava, ja som Karkulka. Idem babičke odniesť košík s jedlom. \r\n- A kde máš košíček? \r\n- Ja krava, ja som ho nechala doma.', 218, 3.64, 40),
	(9345, 'Po čierno-čiernom lese kráča čierno-čierny človek, až dôjde na\r\nčierno-čiernu čistinku, na ktorej horí ohník a pri ňom sedí druhý taký\r\nistý čierno-čierny človek. Ten prvý mu položí čierno-čiernu ruku na jeho\r\nčierno-čierne plece a hovorí:\r\n"Počúvaj, Vasja. Už by si mal prestať páliť tu gumu, zasral si\r\ncelý les."', 352, 3.46, 40),
	(9346, 'Ide karkulka po lese a zrazu oproti nej sa objaví kanón a povie:\r\n"Nazdar, karkulka!"\r\n"Ach, a ty si kto?"\r\n"Ja som kanón."\r\n"Ej,hneď som vedela, že nie si vlk, ten nemá čurák na čele."', 194, 3.6, 40),
	(9347, 'Viete ako chodí ježiško do panelákov?\r\nNo predsa radiátorom!', 65, 3.08, 40),
	(9348, 'popolška dostane tri oriešky. Otvorí prvý - nič. Otvorí druhý - nič. Otvorí tretí, z neho vykukne červík a hovorí:\r\n- Trapas, čo?', 143, 3.52, 40),
	(9349, 'Rytier sa bije s drakom, odsekne mu jednu hlavu a narastú mu dve ďalšie ,odsekne mu druhú hlavu a narastú mu 4 nové hlavy. Rytier prestane sekať a pýta sa draka:\r\n"Počuj,kde máš ukrytú svoju moc?"\r\n"Vo vajci."\r\nRytier sa zaženie a sekne draka do prirodzenia.\r\nDrak skrýkne od bolesti:\r\n"Ty debil myslel som v kačacom."', 333, 3.37, 40),
	(9350, 'Viete prečo už nevysielajú Filmárika a Filmušku?\r\nLebo sa udusili v koberci!', 81, 3.16, 40),
	(9351, 'Príde Ivanovič ku cárovi a vraví:\r\n- Priniesol som vám hlavu draka. \r\nA cár na to:\r\n- No a tu máš ruku princeznej.', 122, 3.41, 40),
	(9352, 'Červená čiapočka ide cez les navštíviť starú mamu a samozrejme že sa stretne z vlkom. Vlk vyskočí spoza stromu a skríkne:\r\n"Mrd, alebo smrť!"\r\nA červená čiapočka:\r\n"Prd, mám krámy."', 200, 3.31, 40),
	(9353, 'Čo si povie trpaslík ked príde k barovej stoličke? \r\nVýťah opäť nechodí...', 83, 3.24, 40),
	(9354, 'Ide si raz takto škaredá ježibaba, ťahá metlu za sebou, na nose štyri chlpaté bradavice, na ramene veľkú čiernu mačku. Oproti kráča krásny mládenec, nuž a takto mu rečie:\r\n"Môj milý, keď uhádneš aké zviera mám na ramene, môžeš ma pomilovať!" Krásavec rozmýšľa:\r\n"Hmm, žeby chameleón?"', 318, 3.21, 40),
	(9355, 'Čupí vlk za kríčkom a okolo ide červená čiapočka. Vlk sa jej pýta: \r\n- Čože máš v tom košíčku?\r\n- Džem a med pre svoju babičku.\r\n- A toaletný papier tam nemáš?', 180, 3.71, 40),
	(9356, 'Stretne vlk červenú čiapočku a prirodzene, že ju znásilní.\r\n- A čo teraz povieš starej mame?\r\n- Že si ma päť krát znásilnil!\r\n- Päť krát? Však ja som ťa iba raz!\r\n- A ty sa niekam ponáhľaš, vĺčik?', 220, 3.56, 40),
	(9357, 'Pribehne Hundroš za tatkom Šmolkom:\r\n"Tatko Šmolka, tatko Šmolka, šmolkovia chcú pošmolkovať Šmolinku."', 112, 3.08, 40),
	(9358, 'Karkulka dostala prvý krát menštruáciu a má strašný strach, lebo nevie čo to je. Rozmýšľa s kým by sa mohla o tom poradiť a rozhodne sa, že s tým zájde za vlkom. Príde teda k vlkovi, že má taký problém, či by sa vlk nemohol na to pozrieť. Vlk sa jej pozerá medzi nohy, neveriacky krúti hlavou a po chvíli povie:\r\n"Karkulka, prisahám fakt, tebe niekto odhryzol gule."', 393, 3.32, 40),
	(9359, 'Malý synček sa pýta otca:\r\n- Oci, draci existujú iba v rozprávke, však?\r\n- Tiež som si to kedysi myslel -  odpovedá otec a pozrie smerom do kuchyne.', 156, 3.42, 40),
	(9360, 'Sedí havran na strome s kusom syra v zobáku. Príde k nemu líška, pozrie na neho, chytí palicu a tresne havrana z celej sily po hlave, zoberie mu syr a zožerie ho. Havran sa preberie na zemi:\r\n- Do prdela, tá rozprávka sa riadne skrátila.', 247, 3.18, 40),
	(9361, 'Červená čiapočka ide po lese, keď ju vlk skrávajúci sa v kríkoch osloví.\r\n- Červená čiapočka, čo to máš v košíku?\r\n- Chlebík a salámku.\r\n- A ešte?\r\n- Vínko a jabĺčko.\r\n- A ešte?\r\n- Klobásku a cibuľku.\r\n- A papier nemáš?', 248, 3.38, 40),
	(9362, 'Do domu troch trpaslíkov príde Snehulienka. V prvej miestnosti vidí 3 stoličky a stôl na ktorom sú 3 polievky. Ochutná prvú - Je príliš slaná. Ochutná druhú - Je málo slaná. Ochutná tretiu - Je akurát, tak ju zje. Vojde do druhej miestnosti a tam zas 3 stoličky a na stole 3 kuriatka. Ochutna prvé - Prepečené. Ochutná druhé - Nedopečené. Ochutná tretie - Akurát, a zie ho. V ďalšej miestnosti sú 3 postele. Ľahne si do prvej - Príliš malá, Ľahne do druhej - Príliš veľká, Ľahne do tretej - Akurát, a zaspí. Prídu domov trpaslíci:\r\n"Niekto mi ochutal polievku."\r\n"Aj mne niekto ochutnal polievku."\r\n"Mne niekto zjedol celú."\r\nTak isto aj s kuraťom. Potom prišli do spálne:\r\n"Mne niekto spal v posteli."\r\n"Aj mne niekto spal v posteli"\r\n"Chlapi serme na to, zhasnime svetlo a poďme spať!"', 837, 3.56, 40),
	(9363, 'Bohatier Iľja Muromec platonicky miluje Krásnu Vasilisu a chcel by získať jej srdce, lenže nevie, ako na to. Preto sa rozhodol, že sa poradí s Trojhlavým drakom. Príde za drakom a hovorí:\r\n"Chcel by som získať Krásnu Vasilisu, ale neviem, ako na to. Ty máš tri hlavy a tri hlavy sú viac ako jedna. Poraď mi, ako ju môžem získať."\r\n"Jednoducho. Zoberieš kijak, trepneš ju po hlave a je tvoja."\r\n"Ale ja myslím ináč. Ja by som s ňou chcel žiť."\r\n"Tak to ti naozaj neviem poradiť, ale choď za mojim starším bratom šesťhlavým drakom, ktorý býva za tromi horami, tromi jazerami a tromi lúkami a ten ti určite poradí."\r\nA tak sa Iľja vybral na cestu. Keď prešiel cez tri hory, tri jazerá a tri lúky prišiel k jaskyni, kde býval Šesťhlavý drak. Zavolal ho vonku a hovorí:\r\n"Drak, ty si taký múdry a vzdelaný, máš šesť hláv, prosím ťa, poraď mi. Chcel by som získať Krásnu Vasilisu, ale neviem ako."\r\n"To je jasné. Vezmeš kijak, trepneš ju po hlave a je tvoja."\r\n"Nie, nie, ja ju milujem a chcel by som s ňou žiť."\r\n"Tak to ti neviem poradiť, ale choď za mojim najstarším bratom Ďeväťhlavým drakom, ktorý býva za tromi horami, tromi jazerami a tromi lúkami a ten je z nás najmúdrejší, ten ti určite bude vedieť poradiť."\r\nA tak sa Ilja opäť vybral na dlhú cestu. Prešiel ďalšie tri hory, tri jazerá a tri lúky až prišiel pred obrovskú jaskyňu, v ktorej býval Ďeväťhlavý drak. Zavolal ho vonku a hovorí:\r\n"Ďeväťhlavý drak, mám jeden problém a tvoji mladší bratia mi nevedeli poradiť, a tak ma poslali za tebou, ževraj ty si najmúdrejší zo všetkých drakov. Chcel by som získať Krásnu Vasilisu, ale neviem ako. Poraď mi, prosím ťa."\r\n"To je jednoduché. Vezmeš kijak, trepneš ju ním po hlave a je tvoja."\r\n"Ale ja som myslel získať ju tak, aby ma milovala, myslel som získať jej srdce a žiť s ňou."\r\n"Tak v tom ti neviem poradiť ani ja, ale choď za našou matkou Starou ježibabou, ktorá býva za šiestimi horami, šiestimi jazerami a šiestimi lúkami v domčeku na stračej nožke. Ona je vševedúca a určite ti poradí."\r\nTak sa zúfalý Ilja vybral opäť na dlhú cestu prešiel šesť hôr, šesť jazier a šesť lúk, keď prišiel k domčeku na stračej nožke. Zavolal Starú ježibabu a hovorí: \r\n"Ježibaba, ty si vraj vševedúca, posielajú ma za tebou tvoji synovia. Mám jeden problém, s ktorým si neviem rady: Chcel by som získať Krásnu Vasilisu, ale neviem ako. Poraď mi."\r\n"Synak, dám ti toto semienko. Musíš s ním prejsť dvanásť hôr, dvanásť jazier a dvanásť lúk až prídeš do svojho rodného kraja. Tam ho zasadíš do rodnej zeme a budeš sa oň starať. Po čase z neho vyrastie nádherný kvet s prenikavou vôňou. Odtŕhneš ho a musíš sa s ním nepozorovane dostať do komnaty Krásnej Vasilisi. Keď tam budeš, položíš ho pod jej posteľ, skryješ sa za záves a budeš čakať. Keď príde Krásna Vasilisa a uloží sa spať, bude sa prehadzovať z boka na bok a nebude môcť zaspať kôli tej prenikavej vôni. Vstane a začne hľadať po celej komnate, čo to tak krásne a prenikavo môže voniať. Keď to nikde nebude vedieť nájsť, pozrie sa aj pod posteľ a keď sa zohne, ty vyskočíš spoza závesu, vezmeš kijak, trepneš ju ním po hlave a je tvoja."', 3358, 3.8, 40),
	(9364, 'Prechádza sa deduško Mrázik po lese, keď tu zbadá pri strome trasúce sa dievčatko. I spýta sa jej:\r\n- Je ti zima, dievčička?\r\n- Čo ti šije?! To je vibrátor!', 169, 3.22, 40),
	(9365, 'Ide princ Vasil cestičkou do zámku. Zrazu uvidí žabu na kameni, ktorá mu hovorí:\r\n- Ahoj Vasil, keď mi dáš pusu, tak sa premením na krásnu princeznú a stanem sa tvojou ženou. Zlá čarodejnica ma zakliala do tejto podoby.\r\nVasil chvíľu váha, no žaba nalieha viac a viac. Napokon ju Vasil pobozká. Po chvíli sa čuduje, prečo sa žaba ešte nepremenila a žaba vraví:\r\n- Vasil, Vasil ty si debil, ja som teplý žabiak Emil.', 444, 3.6, 40),
	(9366, 'Vykračuje karkulka po lese a zrazu stretne vlka. Pýta sa ho: \r\n- Vĺčko, čo robíš a prečo máš také veľké oči?\r\nVlk neodpovedá, k čomu ešte utečie. No nič, povie si karkulka a vykračuje si ďalej. Zachvíľu zas stretne vlka, ale ten opäť utečie. No nič, povie si naštvaná karkulka. S vlkom dnes nieje reč. Ako si tak vykračuje ďalej, zas stretne vlka a teraz už poriadne nasratá mu vraví: \r\n- Prečo máš také veľké oči?\r\n- Sprostá baba. To sa už ani v pokoji vysrať nemôžem?', 516, 3.21, 40),
	(9367, 'Bohatier Iľja Muromec prišiel na rázcestie a tam tabuľka:\r\n1. Keď pôjdeš naľavo, dostaneš po papuli.\r\n2. Keď pôjdeš rovno, dostaneš po papuli.\r\n3. Keď pôjdeš napravo, dostaneš po papuli.\r\nTak sa zamyslene na to díva, keď sa zhora ozvalo:\r\n"Ale rozmýšľaj rýchlo, lebo dostaneš hneď teraz!"', 313, 3.85, 40),
	(9368, 'Snehulienka sa prezlieka v kúpeľni a aby ju trpaslíci videli, poukladali sa na seba a horný pozerá cez kľúčovú dierku. Tí, čo sú pod ním sa ho pýtajú, že čo práve robí.\r\n- Práve si dáva dole tričko...\r\n- No a teraz? Teraz čo robí?\r\n- Teraz si dáva dole podprsenku.\r\n- Hej?A čo teraz?\r\n- Teraz... teraz stojí...\r\n- Aj mne.\r\n- Aj mne.\r\n- Aj mne.', 370, 3.33, 40),
	(9369, 'Popoluška dostane tri oriešky. Otvorí prvý - nič. Otvorí druhý - nič. Z tretieho prázdneho orieška vylezie červík, žmurkne na ňu a hovorí: \r\n- Trapas, čo?', 170, 3.14, 40),
	(9370, 'Beží vlk celý krvavý po lese, stretne drevorubačov:\r\n"Heej! Červenú Karkulku ste nevideli?"\r\n"S košíkom a koláčmi?"\r\n"Nie. S nožíkom a dvoma chlpatými vajcami."', 174, 3.5, 40),
	(9371, 'Matka Červenej Čiapočky hovorí dcére:\r\n"Počula som, že po lese chodí nebezpečný vlk Casanova.\r\nZober si ty preto radšej železné nohavičky!"\r\nČervená čiapočka urobila ako mamička nakázala, zobrala košík\r\npre babičku a poďho do lesa. Keď sa dlho nevracala, zašla mamička\r\nza horárom, či jej dcéru náhodou nevidel.\r\n"Ju som nevidel " - horár na to rečie -" ale zato som tu videl vlka\r\npobehovať s autogenom!"', 439, 3.45, 40),
	(9372, 'Úvod rozprávky: \r\nBol baz jeden kráľ. Mal dvoch synov a tri dcéry, až mu na to jedného dňa kráľovná prišla.', 119, 3.33, 40),
	(9373, 'Viete čo sa stane zo Snehulienky keď sa dotkne drôtov vysokého napätia?\r\nPopoluška!', 89, 3.28, 40),
	(9374, 'Les, klasické stretnutie - vlk a karkulka. Karkulka sa pýta:\r\n- Ty si kto?\r\n- Ja som rýchlomilujúci vlk.\r\n- A bolí to?\r\n- Prečo, bolelo ťa? ', 147, 3.4, 40),
	(9375, 'Ide Janko s Marienkou po lese a Jankovi sa zachcelo. Aby dostal Marienku začal vymýšľať:\r\n- Počul som Marienka, že v lese býva vták ktorý sa vola mozgoďob a keď niekoho nájde vyďobe mu mozog z hlavy.\r\nMarienka sa zľakla:\r\n- A exsistuje proti nemu nejaká ochrana?\r\n- Samozrejme - vraví Janko. \r\n- A k ho uvidíš stačí iba vopchať hlavu do kríka a je to.\r\nChvíľu idú mlčky a Janko zrazu zvolá:\r\n- Marienka! Mozgoďob!\r\nMarienka strčila hlavu do kríka a  Janko jej stiahol nohavičky.\r\nPo chvíli Marienka kričí:\r\n- Len si ďobaj mozgoďob! Do mozgu sa aj tak nedoďobeš!', 600, 3.4, 40),
	(9376, 'Je jedno království a v něm žije pan král se svoji dcerou. Jednoho dne si řekne, že už je dost stará a dá vyhlásit, že kdo si pro princeznu přijede, dostane ji a půlku království. Jelikož je princezna docela kost, sjíždějí se nápadníci z celého světa. Princezna jde s každým do parku, ale vrací se vždycky sama. Královské stáje už jsou přeplněné koňmi bez pánů, v okolí je pánská populace značně prořídlá, už se ukazuje jen tak jeden nebo dva týdně a král začíná mít strach, aby mu dcera moc nezestárla.\r\nJednou takhle přijede kdo jiný, no Honza samozřejmě. Jde s princeznou do parku. Uprostřed parku je rybníček plný krokodýlů. Princezna si stáhne z ruky prsten, hodí ho mezi ty zubatý potvory a říká:\r\n"Vyndej ho."\r\nHonza, jednoduchej kluk z vesnice, nepřemejšlí a reflexivně šáhne dolů, rozepne poklopec a vytáhne si ho. Princezna říká:\r\n"No vidíš, a ti blbci tam všichni skákali."', 971, 3.42, 40),
	(9377, 'Ide si červená čiapočka po lese a zrazu zbadá vlka, ako čupí v kríčku.\r\n- Jéé vlk, ty máš ale veľké zuby.\r\nVlk sa zľakne a utečie preč. Po chvíli ho čiapočka opäť vidí čupieť v kríčku.\r\n- Jéé vlk, ty máš ale veľké uši.\r\nVlk zasa zdrhne, no čiapočka ho neskôr znovu vidí čupieť v kríčku.\r\n- Vlk, ty máš ale veľké oči!\r\n- Mám čiapočka, mám, ale môžem sa konečne vysrať?', 423, 3.1, 40),
	(9378, 'Jánošíka vedú na popravisko. V poslednej chvíli sa vythrne drábom z rúk, otočí sa do davu a zvolá:\r\n- Ľudia, za čo?\r\nA z davu sa ozve:\r\n- Za rebro! Za rebro!', 169, 3.4, 40),
	(9379, 'Stredovek, súťaž v streľbe o princezninu ruku. Prichádza prvý súťažiaci. Položí princeznej na hlavu jablko, odstúpi dvesto krokov, natiahne luk, rozstrelí jablko na polovice a zvolá:\r\n- I am Robin Hood.\r\nDruhý urobí to isté, odstúpi tristo krokov, jablko rozstrelí na polky a povie:\r\n- I am Wiliam Tell.\r\nPríde žobrák, položí na hlavu princeznej ohryzok, odstúpi dvadsať krokov, strelí princeznej do oka a zvolá:\r\n- I am sorry.', 455, 3.52, 40),
	(9380, 'Ide červená čiapočka po lese. Zrazu ju prepadne vlk a vraví:\r\n- Teraz ťa znásilním!\r\nStalo sa! Červená čiapočka vraví:\r\n- Teraz ťa zažalujem starej mame, že si má 5x znásilnil!\r\n- Akože 5x? Iba raz!\r\nČervená čiapočka:\r\n- A prečo? Ty sa niekde ponáhľaš?', 279, 3.42, 40),
	(9381, 'Príde princ ku ropuche. Ropucha mu vraví:\r\n- Pobozkaj ma.\r\nPrinc sa pýta:\r\n- A čo dostanem?\r\n- Uvidíš.\r\nPrinc ju teda pobozká. \r\n- Tak teda čo dostanem?\r\nRopucha mu hovorí:\r\n- Herpez!', 192, 3.01, 40),
	(9382, 'Viete, čo sa stane zo snehulienky, keď strčí rúčky do zástrčky?\r\nBude z nej popoluška.', 95, 3.15, 40),
	(9383, 'Janko Hovienko príde do zmenárne mien. Janko hovori:Dobrý deň teta chcem si zmeniť meno. A ako sa voláš? Janko Hovienko. A ako sa chceš volať? Ferko Hovienko.', 167, 3.61, 40),
	(9384, 'Veverička lúska oriešky. Rozlúskne prvý: bronzové šaty. Rozlúskne druhý: strieborné šaty. Rozlúskne tretí: zlaté šaty. Smutne si sadne a hovorí:\r\nJa sa asi kvôli tej rozprávke nenajem.', 202, 3.55, 40),
	(9385, 'Ide babička s vnúčikom a vnučkou do parku. Vtom vnúčikovi treba ísť cikať a babka mu poradí, aby šiel do kríkov. Vnučka sa medzitým spýta babky:\r\n- Babi, čo to majú chlapci medzi nohami?- To je peniažtek, - odpovedá babka.Vnúčik sa vráti a vtom chce ísť cikať zas vnučka. Medzitým ako v kríkoch ciká, pýta sa vnúčik babky:- Babka, čo to majú dievčatá medzi nohami?A babka odpovie:- To je pokladnička. Vrátia sa z parku a babka musí odísť do obchodu. Vnúčik aj vnučka ostanú doma. Keď sa vráti, pripraví im obed a začne hľadať deti. Nemôže ich nájsť, tak na ne zakričí:- Deti, kde ste? Tie zakričia späť:- V kúpeľni.- A čo tam robíte?- Nič, pokúšame sa len, dať peniažtek do pokladničky...\r\n', 760, 3.9, 40),
	(9386, 'Rozprávajú sa dva bacily :\r\nČo sa ti stalo?\r\nÁáále, asi som chytil penicilín!', 84, 3.49, 40),
	(9387, 'Viete čo sa stane zo snehuliakov, keď sa chytia elektrického vedenia?\r\nNo predsa Popoluška...', 97, 3.11, 40),
	(9388, 'Mrázik sa pýta dievčiny: "Je ti zima dievčatko?Čo ti šibe hlupák starý, to je vibrátor!"', 97, 3.72, 40),
	(9389, 'V škôlke sa učia o bezpečnosti a prvej pomoci. Pani učiteľka sa pýta Terezky Rídovej: "Tak Terezka, čo by si robila, keby malá Katka zhltla klúč?" \r\n"Asi by som vliezla dnu oknom."', 192, 3.68, 40),
	(9390, '- Viete prečo sa trpaslíci cestou domov smejú?\r\n- Lebo ich tráva šteglí na gule.', 86, 3.32, 40),
	(9401, 'Išiel poľovník po lese, keď sa potkol o konár a strelil si brokovnicou rovno medzi nohy. V nemocnici ho dali ako tak dokopy a po operácii lekár podáva pacientovi navštívenku. \r\n”Toto je adresa môjho priateľa. Navštívte ho, iste vám pomôže.”\r\n”Aj on je lekár?”\r\n”Nie, on je fujarový virtuóz. Naučí vás prstoklad, aby ste si nenačúrali medzi oči!”              ', 397, 4.18, 41),
	(9402, 'Dvaja sedia v saloone na Divokom západe a jeden hovorí:\r\n”Vidíš tam toho v tom klobúku?”\r\n„Ktorého, všetci majú klobúky?”\r\n”Veď ten čo má kolty za opaskom.”\r\n”Všetci majú kolty za opaskom.”\r\n”Ale ten, čo má kožené čižmy.”\r\n”Všetci majú kožené čižmy.”\r\nPrvý sa nahnevá a okrem jedného všetkých postrieľa.\r\n”No vidíš, toho čo zostal?”\r\n”Jasné.”\r\n”Strašne ho neznášam.”              ', 455, 4.17, 41),
	(9403, 'Rodina Slovákova ide na dovolenku. \r\n”Stáť!”, skríkne zrazu pani Slováková.\r\n”Musíme sa vrátiť! Zabudla som vypnúť žehličku! Dom nám zhorí!”\r\n”Pokojne, miláčik,” odvetí jej pán Slovák.\r\n”Nezhorí. Práve som si spomenul, že som v kúpeľni zabudol zavrieť kohútik!”              ', 318, 4.21, 41),
	(9404, 'Chlapík si po obede v reštike prdne, strašne sa hanbí a tak aby\r\nzakryl čo sa stalo, trocha povŕzga stoličkou. Nahne sa k nemu chlapík\r\nodvedľa\r\na hovorí:\r\n-Úplne iný zvuk, čo?              ', 203, 4.02, 41),
	(9405, 'Oko volá ten malý vták, čo sladká vazelína nosí a celofánové krídlo letí. \r\nČella.              ', 108, 3.19, 41),
	(9406, '"Koľko vážite?" pýta sa lekár pacienta.\r\n"60 kg." odpovedá pacient.\r\n"A akú ste mali najvyššiu váhu?"\r\n"72 kg."\r\n"A najnižšiu?"\r\n"3,80 kg."               ', 166, 3.59, 41),
	(9407, 'Za siedmimi horami, siedmimi dolinami, siedmimi morami stojí chalúpka a v tej chalúpke za stolom sedí babka\r\na nadáva: \r\n"Prečo ja musím tak ďaleko bývať!"              ', 179, 4.11, 41),
	(9408, 'Posledné slová pred smrťou:\r\nSom pripútaný, idem na to...              ', 76, 3.75, 41),
	(9409, 'V lietadle sa pýta cestujúci letušky:\r\n"Slečna, nezdá sa vám, že letíme akosi nízko?"\r\n"Prečo si to myslíte, pane?"\r\n"Práve teraz som videl za oknom obrovskú chobotnicu."              ', 197, 3.71, 41),
	(9410, 'Sedi bača pri salaši a okoloidúci turista sa ho pýta."No sevas bača. Počuj a čo si to tak hrabeš pod nechtami?"\r\n-"Ale, rozmýšlam, že či pod tým nechtom mám hlinu alebo hovno."\r\n-"Vieš čo daj sem ja ochutnám."\r\nBača vyškrabne kúsok hmoty a dá mu ochutnať. \r\n-"Po chvílke FÚUUJ bača veď to je hovno."\r\n-Bača na to. "Tiež som si myslel, kde by sa mi v riti vzala hlina."              ', 410, 4.11, 41),
	(9411, 'Chlapík si chvíľu prezerá jedálny lístok a potom zavolá vrchného\r\na zaujíma sa:\r\n”Prosím vás, tá hovädzia pečeň je bravčová alebo kuracia?”              ', 174, 4.21, 41),
	(9412, '”Oco, čo je to vákuum?”\r\n”Mám to v hlave, synak, ale nejde mi to na jazyk!”              ', 100, 3.94, 41),
	(9413, 'V reštaurácii:\r\n”Čašník, to jedlo bolo vynikajúce. Kuchár je na dovolenke?”              ', 100, 3.6, 41),
	(9414, 'V reštaurácii:\r\n”Pán vrchný, na ten vyprážaný syr s hranolkami čakám už dve hodiny!”\r\n”To vám nemusí vadiť, máme otvorené až do rána.”              ', 173, 3.57, 41),
	(9415, 'Zákazník v bufete sa pýta:\r\n”Čo znamená ten rýchly výpredaj?”\r\n”Zajtra k nám príde hygienik.”              ', 124, 3.88, 41),
	(9416, '”Prosím si čaj. Ale bez cukru!“\r\n„Hm, cukor už nemáme, ale môžem vám ho doniesť bez citrónu.“              ', 124, 3.7, 41),
	(9417, 'Fero s Marou sedia v obývačke a pozerajú v telke reláciu so zázračným liečiteľom. Liečiteľ vraví:\r\n”Vyliečim vaše neduhy na diaľku. Priložte si teraz ruku na tú časť tela, ktorá má byť vyliečená...”\r\nMara si priloží ruku na srdce a Fero do rozkroku. Nato Mara poznamená:\r\n”Ferko! On ide liečiť chorých!\r\nNie oživovať mŕtvych...”              ', 383, 3.13, 41),
	(9418, 'V psychiatrickej liečebni sa ozve telefón: \r\n”Haló?”\r\n”Pozrite sa, prosím, či je niekto v izbe číslo desať.”\r\n”Nie, nikto tam nie je...” informuje sanitár.\r\n”Tak sa mi predsa podarilo ujsť! Hurá!”              ', 237, 4.27, 41),
	(9419, 'Oko volá ten veľká tvrdá žaba, čo neskáče, ale  plazuje?\r\nKorytnák.              ', 90, 3.78, 41),
	(9420, 'Telefonát do rádia:\r\n”Nemám rád mačky. Ten zápach, všade tie chlpy...”\r\nOdpoveď z rádia: \r\n”Pravdepodobne neviete mačku správne upiecť.”              ', 170, 3.86, 41),
	(9421, 'Turista prechádza dedinou a vidí ako na terase pred domom hrá dedinčan šach so svojím psom. \r\n”No toto, snáď mi nechcete povedať, že váš pes vie hrať šach!”\r\n”Čerta starého vie, dnes už prehral štvrtú partiu.”              ', 250, 4, 41),
	(9422, 'Na parížskej policajnej stanici zvoní telefón a mužský hlas hovorí:\r\n”Chcem vás upozorniť, že zajtra ráno bude v bouloňskom lesíku súboj dvoch mužov...”\r\n”Už to vieme, váš súper volal práve pred chvíľou.”              ', 248, 3.5, 41),
	(9423, 'Babka s dedkom idú po meste a pozerajú sa na mladých ľudí. Babka vraví:\r\n”Dedko, pozri, akí sú tí mladí chlapci dnes skromní. Piati fajčia jednu cigaretu a ešte sa pritom smejú.”              ', 210, 3.89, 41),
	(9424, 'Stretnú sa dve kamarátky:\r\n”Predstav si, tá Mara sa ale má. Má muža, milenca a ešte ju aj znásilnili.               ', 126, 3.59, 41),
	(9425, 'Dvaja alkoholici hrajú šach na kanálovej mreži, keď tu zrazu jeden vykríkne:\r\n”Do kelu! Niekto nám kradne figúrky!”              ', 141, 3.86, 41),
	(9426, '”Je to pravda, suseda, že váš manžel je na psychiatrii?”\r\n”Áno, ale nie ako pacient, ale ako detektív. Viete, oni tam majú piatich Napoleonov a môj manžel má zistiť, ktorý z nich je ten pravý.”              ', 228, 3.38, 41),
	(9427, '”Oblečte sa, slečna, odveziem si vás domov,” hovorí hosť peknej čašníčke.\r\n”pretože vidím, že v účte ste už aj vy.”              ', 152, 3, 41),
	(9428, 'Hosť sa osopí na čašníka:\r\n”Vidím dobre, či sa mi to iba zdá? Vy utierate  tanier vreckovkou?”\r\n”Mne to nevadí, už je aj tak špinavá.”              ', 168, 3.71, 41),
	(9429, 'V blázninci príde lekár na vizitu k pánovi Novákovi a pýta sa ho:\r\n”Tak čo, pán Novák, čo ste?\r\n”Červík.” odpovie pán Novák.\r\n”Tak to si vás tu ešte necháme.”\r\nRovnaká situácia sa opakuje aj po ďalšie dni. O týždeň sa lekár opýta opäť to isté a pán Novák odpovedá:\r\n”Som pán Novák.”\r\n”Výborne,” teší sa lekár,\r\n”ste zdravý, môžete ísť domov.”\r\n”Nemôžem,” zamrmle Novák,\r\n”za dverami je drozd.”              ', 483, 4.24, 41),
	(9430, '”Ty sa sťažuješ, že máš problémy?” hovorí jeden podnikateľ druhému. ”A čo mám povedať ja? Požičal som 50 tisíc známemu na plastickú operáciu a teraz neviem,\r\nako vlastne vyzerá.”              ', 220, 3.97, 41),
	(9431, 'Stretnú sa dvaja:\r\n”Ako sa má tvoj nový papagáj?”\r\n”Umrel týždeň po tom, čo som ho kúpil.”\r\n”Čože, a prečo?”\r\n”Na vyčerpanie. Súťažil s mojou ženou v ukecanosti.”\n', 196, 3.6, 41),
	(9432, '”Je to pravda, suseda, že váš manžel je na psychiatrii?”\r\n”Áno, ale nie ako pacient, ale ako detektív. Viete, oni tam majú piatich Napoleonov a môj manžel má zistiť, ktorý z nich je ten pravý.”\n', 215, 4.07, 41),
	(9433, 'Prechádzajú sa dvaja pacienti po dvore blázinca. Jeden zodvihne hlavu a hovorí:\r\n”Tam hore, to je slnko alebo mesiac?”\r\n”Neviem,” odpovie druhý, ”nie som tunajší.”\n', 183, 4.13, 41),
	(9434, 'Sťažuje sa psychiater kolegovi:\r\n”Jeden blázon mi stále predáva Niagarské vodopády. Už neviem, čo mám robiť.”\r\n”A prečo ich nekúpiš?”\r\n”Nemôžem, predáva ich veľmi draho.”              ', 214, 3.91, 41),
	(9435, 'Väzeň vraví spoluväzňovi:\r\n”Želám ti šťastný nový rok.”\r\n”Ale veď je len máj.”\r\n”Áno, ale počul som, že ti ešte rok pridali.”              ', 168, 4.05, 41),
	(9436, 'Do krčmy príde chlapík a pýta sa:\r\n”Pán hostinský, už prišiel niekto z tých idiotov, s ktorými sedávam pri stole?”\r\n”Ešte nie, pane, vy ste prvý.”              ', 181, 3.97, 41),
	(9437, '”Petra, zopakuj čo som vám na poslednej hodine rozprávala o Mojžišovi.”\r\n”Mojžiš bol synom egyptskej princeznej.”\r\n”Ale Petra, nedávala si pozor! Princezná ho iba našla v košíku, ktorý plával v Níle.”\r\n”To vraví ona!”              ', 263, 3.69, 41),
	(9438, 'Bezdomovkyňa sa prehrabuje v kontajneri, zrazu nájde použitý kondóm, dá si ho k ústam, celý ho vycucne a hovorí si:\r\n”Tí bohatí ľudia nechávajú toľko sadla v tých jaterniciach...”              ', 213, 3.45, 41),
	(9439, 'Pýta sa čašník zákazníka:\r\n”Prajete si pivo alebo rum?”\r\n”Áno.”\n', 79, 3.89, 41),
	(9440, 'Učiteľka sa pýta žiakov na slovenčine:\r\n”Žiaci, som pekná. Aký je to čas?”\r\n”Minulý!”              ', 117, 4.26, 41),
	(9441, 'Na súde:\r\n”Poškodená, prečo ste nekričali o pomoc, keď vás obžalovaný znásilňoval?”\r\n”Pretože povedal, že ak budem kričať, tak ho vytiahne...”              ', 179, 4, 41),
	(9442, '”Haló! To je spolok na ochranu zvierat?”\r\n”Áno, čo si prajete?”\r\n”Rýchlo sem niekoho pošlite! Vo dvore je na strome poštár a strašne nadáva nášmu psovi!”              ', 190, 4, 41),
	(9443, 'Pacientka ústavu pre bláznov sa prišla sťažovať lekárovi.\r\n”Pán doktor, prosím vás, preložte ma na inú izbu.”\r\n”A prečo?”\r\n”Každú noc moja susedka strká prsty do elektrickej zásuvky a kričí "Som lampa, som lampa!" \r\nA pán doktor, vy viete, že keď svieti lampa ja nemôžem spať.”              ', 328, 3.79, 41),
	(9444, 'Peťo stretne na námestí v strede mesta Jara. Jaro tlieska ako o život. Peťo sa ho pýta: \r\n-"Jaro, prečo tak tlieskaš"?\r\nJaro odpovedá:"preto aby som odplašil krokodílov".\r\nPeťo mu dodá:"veď tu žiadne krokodily nie sú".\r\nJaro:"no práve, preto lebo tlieskam"              ', 287, 4, 41),
	(9445, '”Pán hlavný, tie kurence tu robíte fantasticky. Ako ich pripravujete?”\r\n”Pripravujeme? Proste im povieme, že ich zabijeme a upečieme.” \n', 149, 3.83, 41),
	(9446, 'Vnuk sa pýta dedka:\r\n”Dedo, kde sú muchy v zime?”\r\nDedo na to:\r\n”To neviem, ale mohli by tam byť aj v lete!”              ', 133, 3.94, 41),
	(9447, 'Janko vraví mamičke:\r\n”Idem si natrhať čerešne.”\r\n”Ale veď je zima!”\r\n”To nič! Dám si rukavičky.”              ', 132, 3.87, 41),
	(9448, 'Malý Jožko dostal poznámku:\r\n”Váš syn nevedel, kto rozbil atóm.”\r\nOtec rozčúlený dopísal:\r\n”Kto ho rozbil, ten ho rozbil, ale ja to platiť nebudem!”              ', 181, 3.98, 41),
	(9449, 'Stretnú sa dvaja starí známi a jeden z nich je super nahodený. Nový oblek, kravata, drahý kabát, topánky a kufrík z krokodíla. Ten druhý sa ho pýta:\r\n“Asi sa ti dobre darí, keď chodíš taký vyobliekaný.”\r\n“Ale vieš, otvoril som si taký malý butik.”\r\n“Hej, a s čím?”\r\n“Normálka, so šperhákom!”              ', 347, 3.88, 41),
	(9450, '”Človeče, predstav si,\r\nna víkend hlásili 30 stupňové horúčavy!”\r\n”To nie je možné.”\r\n”Ale áno. 15 stupňov\r\nv sobotu a 15 stupňov\r\nv nedeľu.”              ', 181, 4.18, 41),
	(9451, 'Čašník zbadá, ako si hosť čistí príbor obrusom a napomína ho:\r\n”Prepáčte, ale to nerobte.\r\nPo prvé, príbor je čistý. A po druhé, pozrite sa, ako ste zašpinili obrus!”              ', 201, 3.25, 41),
	(9452, 'Jeden zatvárací špendlík sa sťažuje druhému:\r\n”Je mi teplo!”\r\nDruhý odpovedá:\r\n”Tak sa rozopni.”              ', 127, 3.5, 41),
	(9453, 'Na pohotovosti zvoní telefón:\r\n”Pán doktor, rýchlo príďte, malý zjedol prezervatív!”\r\nO chvíľku zvoní telefón znova:\r\n”Pán doktor, už nemusíte, našli sme druhý.”              ', 200, 4.03, 41),
	(9454, 'Psychiater prevádza hosťa po nemocnici.\r\n”Toto je izba pre automobilových bláznov.”\r\n”Ale veď tu nikto nie je.”\r\n”Omyl, všetci sú pod posteľami a opravujú.”              ', 191, 4, 41),
	(9455, 'Rabín a kňaz sú susedia. Kňaz sa rozhodne urobiť dobrý skutok a tak umyje rabínovi strašne špinavé auto. Rabín sa naštve a odreže kňazovi výfuk na jeho aute. Kňaz mu povie: Prečo si to urobil? Rabín mu povie: Keď ty mi môzeš auto pokrstiť tak ja ti ho môžem obrezať!              ', 305, 4.1, 41),
	(9456, 'Ide ožratý chlapík z krčmy a na rohu sa vyvracia. Ihneď pribehne reportér a kričí do kamery:\r\n”Tak toto váš jogurt nedokáže!”              ', 155, 3.07, 41),
	(9457, 'Stretnú sa dve kostry a jedna sa pýta druhej:"Kde ideš?"\r\n"Na kožné."\n', 75, 3.4, 41),
	(9458, '”Vieš, čo som zistil, Milan?” rozpráva Fero. ”Že je veľmi nezdravé piť z cudzieho pohára...”\r\n”A prečo, dostal si nejaké vyrážky?”\r\n”Nie, ale facku ako hrom!”              ', 200, 4, 41),
	(9459, 'Čašník sa pýta hosťa:\r\n”Máte prázdny pohárik, mám vám priniesť ďalší?”\r\n”A čo budem robiť s dvoma prázdnymi pohármi?”              ', 157, 4.17, 41),
	(9460, 'Nad kočíkom sa skláňa staršia pani a pýta sa:\r\n”Kohože je toto krásne dieťatko?”\r\n”Ešte neviem, zajtra máme súd.”              ', 147, 4.14, 41),
	(9461, 'Jožo príde domov a kričí:\r\n”Araňa, keď si trochu vypijem, hneď si krajšia!”\r\n”Jožo, ty debil, veď to som ja, tvoj brat Fero!”              ', 157, 4.21, 41),
	(9462, 'Príde asi štyridsať ročný chlapík do krčmy a hovorí kamarátom sediacim okolo stola:\r\n”Išiel som po ulici a šiesti oproti mne. Všetkých som pobil a tomu šiestemu som takú zabil, že mu šlabikár z tašky vypadol.”              ', 246, 3.86, 41),
	(9463, 'Študentku skúšajú z medicíny:\r\n”Koľko spermií vylúči muž na jeden raz?”\r\n”Plné ústa.”\r\n”Ale ja sa pýtam, aké množstvo?!”\r\n”Asi tak na tri glgy.”              ', 189, 3.67, 41),
	(9464, 'Do chovproduktu vrazí rozčúlený muž s ľadovým medveďom na vodítku:\r\n”Kde je ten blbec, čo mi pred rokom predal bieleho škrečka?!”              ', 159, 3.93, 41),
	(9465, 'Fero vidí Miša a už z diaľky kričí:\r\n”Vieš, čo je nové? Zrušili daňový úrad!”\r\n”Neblázni!”\r\n”Naozaj! Dostal som od nich list a v ňom stálo: Posledná upomienka!”              ', 203, 3.8, 41),
	(9466, 'Zišli sa traja remeselníci a hádali sa, ktoré povolanie je najstaršie. Prvý vraví: \r\n”Ja som murár a moje remeslo je najstaršie, lebo murári už v Egypte stavali pyramídy.”\r\nDruhý vraví: \r\n”To nie je pravda. Ja som tesár a moje remeslo je najstaršie, lebo tesári už vyrezávali Noemovu archu.”\r\nA tretí vraví: \r\n”To je nič. Ja som elektrikár a moje remeslo je najstaršie, lebo keď Boh povedal ”A bude svetlo!”, my sme už museli mať naťahané káble.”              ', 506, 4.18, 41),
	(9467, 'Sekretárka vraví riaditeľovi:\r\n”Pán riaditeľ, prišla vám sms-ka.”\r\nRiaditeľ na to:\r\n”Nech vojde.”              ', 127, 3.14, 41),
	(9468, 'Dežo volá do parlamentu.\r\n”Haló, počul som, že tam máte voľné miesto.”\r\n”Čo ste sa zbláznili?”\r\n”To nie, ale ak je to podmienkou, tak môžem.”              ', 179, 3.88, 41),
	(9469, 'Žena u lekára po prehliadke:\r\n”Pán doktor, som vážne chorá?”\r\n”Nie je to také zlé, ale ak sa chcete uzdraviť, mali by ste každý deň zjesť jedno vajce.”\r\n”Viete pán doktor, ale keď ja vajíčka neznášam.”\r\n”Povedal som zjesť, nie zniesť.”              ', 286, 3.89, 41),
	(9470, 'Príde slepec na pláž, vybalí sa a začne si nafukovať ”nafukovaciu Anču”. Pristúpi k nemu plavčík a hovorí:\r\n”Nepríde vám to blbé ležať na pláži na nafukovacej Anči?”\r\n”Do kelu, tak to som sa celý týždeň miloval s nafukovačkou!”              ', 277, 4, 41),
	(9471, 'Tri priateľky, prostitútky, sa medzi sebou chvália:\r\n”Ja som za jednu noc urobila z chlapa impotenta!”\r\n”A ja som za jednu noc urobila z impotenta chlapa!”\r\n”A ja dokážem za minútu jazykom poskladať rubíkovú kocku!”              ', 250, 3.91, 41),
	(9472, 'Manžel je bez peňazí, tak pošle manželku na ulicu, aby niečo zarobila. Žena sa vyparádi, zoberie kabelku a vyrazí. Ráno sa vráti celá strapatá, opuchnutá a v rukách zviera päťsto jedna korún. Manžel vezme peniaze a hovorí:\r\n- No, na začiatok to nie je zlé, ale prosím ťa, kto ti dal tú korunu?\r\n- Skoro každý.              ', 350, 4.06, 41),
	(9473, 'V cirkuse vrcholí hlavné číslo. Krotiteľ strká stoporený úd priamo do krokodílovej tlamy. Potom ho ešte poriadne buchne päsťou po hlave, ale krokodíl iba privrie tlamu a krotiteľovi sa nič nestane. Obecenstvo šalie, má to obrovský úspech. Krotiteľ vyzýva divákov:\r\n- Nájde sa nejaký odvážlivec, ktorý to chce skúsiť?! Odmena je tisíc korún!\r\nPrihlási sa nesmelo jedna z prítomných dám:\r\n- Ja by som to skúsila, ale nesmeli by ste ma tak búchať po hlave.              ', 505, 3.84, 41),
	(9474, 'Príde chlapík do verejného domu a pýta sa:\r\n- Mal by som jedno špeciálne želanie. Chcel by som hrozne škaredú a vychudnutú ženu.\r\nPošlú ho do jednej izby. Chlap vojde dnu a tam čaká hnusná, na kosť vychudnutá žena. Chlap jej vraví:\r\n- Prosím vás, vyzlečte sa do naha a kľaknite si na štyri.\r\nŽena to urobí, muž vybehne von a o chvíľu sa vráti so svojím psom a vraví mu:\r\n- Tak, Rexo, vidíš? Takto budeš vyzerať, keď nebudeš poriadne žrať!              ', 493, 4, 41),
	(9475, 'Na koncerte sa pán nakloní k susedovi a šepká mu:\r\n- Tá speváčka má ale príšerný hlas. Neviete, kto to je?\r\n- Moja dcéra. - odpovedá muž.\r\n- Tak to sa ospravedlňujem. To bude asi tou piesňou. Tá je fakt hrozná. Rád by som vedel, kto ju zložil.\r\n- Ja.              ', 284, 3.97, 41),
	(9476, 'Letecká linka Moskva - Bratislava. Krátko po štarte vrazí k pilotovi do kabíny chlapík s pištoľou a kričí:\r\n- Do Viedne!\r\nPilot pokojne odpovedá:\r\n- Nedá sa.\r\nChlapík znervóznie a opakuje:\r\n- Hovorím do Viedne, lebo budem strieľať!\r\n- Nedá sa, mladý muž. Obzrite sa, za vami sedí babka, má bombu a už si objednala Mníchov.              ', 360, 4.02, 41),
	(9477, 'Matka hovorí dcére:\r\n- Keď mi tvoj otec kľačal pri nohách...\r\n- Ja? Nikdy! - zamiešal sa do rozhovoru otec.\r\n- Neprerušuj ma, prosím! Povedala som  - jej otec.              ', 182, 4, 41),
	(9478, 'Otec sa rozhodol, že je najvyšší čas dostať nezbednému synovi do hlavy trochu rozumu. Vraví mu:\r\n- Pozri, synak. Už budeš dospelý a mal by si začať brať život vážne. Uvedom si, kde by si bol, keby som teraz náhle umrel.\r\n- No, ja by som bol presne tu. Otázka je, kde by si bol ty.              ', 313, 3.89, 41),
	(9479, 'Príde atraktívna žena k barovému pultu, začne obsluhujúcemu eroticky prehrabávať vlasy, krásne sa na neho usmieva a zvodne hovorí:\r\n- Mucinko, ty si tu šéf?\r\n- Nie... - s námahou odpovie barman.\r\nŽena mu prechádza vlhkým prstom po krku a brade a hovorí:\r\n- A príde dnes šéf?\r\n- Neviem, slečna...\r\nŽena mu pomalým pohybom vloží prst do úst, on ho vzrušene olizuje a ona hovorí:\r\n- Tak keď príde, povedz mu, že na dámskych toaletách nie je papier...              ', 494, 4.02, 41),
	(9480, 'Príde Slovák k Mongolovi a pýta sa ho:\r\n”Počuj, a ty máš koľko otcov?”\r\nA Mongolec odpovedá:\r\n ”Jedného.”\r\nA Slovák na to:\r\n”To mi nevrav, veď z dvoch vajec nemôžeš byť taký žltý.”              ', 224, 3.57, 41),
	(9481, 'Prečo sa poľskí manželia rozhodli, že budú mať len štyri deti?\r\nČítali v novinách, že každé piate dieťa, ktoré sa narodí, je Číňan.\n', 152, 3.83, 41),
	(9482, 'Prídu kanadskí drevorubači k ruským a darujú im novú motorovú pílu. Tak Rus ide do lesa a Kanaďan za ním ešte volá:\r\n"S touto pílou urobíš 2000 kubíkov za deň!"\r\nRus večer príde zničený:\r\n"1700 a viac nič."\r\nKanaďanovi to nejde do hlavy, tak že mu to ukáže. Naštartuje pílu, ozve sa rev, Rus priskočí a pýta sa:\r\n"Što eto?"\n', 356, 3.79, 41),
	(9483, 'Pýtajú sa lovca, čo ulovil v Afrike.\r\n"3 levov, 5 antilop a 10 nouplisakov."\r\n"????"\r\n"Také to čierne, zdvíha to ruky a hovorí \'nouplis\'!"\n', 146, 4.02, 41),
	(9484, 'Pani Nováková vraví synovi:\r\n"Matka musí pre svoje dieťa obetovať všetko. Keby som si nedokázala odtrhnúť od úst, tak by si tu nebol, milý synak."              ', 172, 3.5, 41),
	(9485, 'Po púšti ide Arab na ťave a je strašné teplo. Náhle okolo prefrčí cyklista. Keď sa večer zídu, pýta sa ho Arab, ako to robí, že mu nie je pri jazde teplo. \r\nCyklista povie, že ide tak rýchlo, že ho vzduch ochladí. Arab skočí na ťavu a tá po hodine uháňania padne m?tva. Arab naštvane hovorí:\r\n"Asi zmrzla, sviňa!"\n', 341, 3.85, 41),
	(9486, '- Kto je?\r\n- Sused\r\n- A čo chcete, človeče, takto neskoro v noci?\r\n- Máte cesnak?\r\n- Nemáme!\r\nAsi za pol hodiny zvoní zvonček znovu.\r\n- Kto je?!\r\n- Sused.\r\n- A čo zase chcete?!\r\n- Nič, nesiem vám cesnak.               ', 228, 4.25, 41),
	(9487, '- Pani, vy máte parochňu?\r\n- Vidíte, a v obchode mi povedali, že ju nikto nerozozná od skutočných vlasov. \r\n- Možno nie, ale zabudli ste na nej cenovku.              ', 174, 3.93, 41),
	(9488, '- Pán vrchný, je toto naozaj rybacia polievka? pýta sa hosť v reštaurácii. \r\n- Samozrejme, pane, na vlastné oči som videl aké mala obrovské plutvy! Ak chcete, prinesiem vám ich ukázať i s tými kyslíkovými fľašami, čo mala na chrbte!              ', 265, 3.83, 41),
	(9489, '- Vravíte, že vám ušiel pes? Ako vyzeral?\r\n- Stredne veľký, hnedý... Keď na neho zavoláte: "Brok, poď sem" a on nejde, tak je to určite on.              ', 164, 3.5, 41),
	(9490, '- Vraciam sa domov a čo nevidím. Štyria tam bijú jedného. Čo mi ostávalo? Musel som sa zamiešať!\r\n- A ako to dopadlo?\r\n- No, zmlátili sme ho ako koňa.              ', 175, 3.64, 41),
	(9491, '- Pán doktor, ten môj kanárik nespieva a nespieva. Čím to asi bude?\r\n- Asi tým, že je vypchatý.              ', 117, 3.43, 41),
	(9492, '- Predávate sedmové karty?\r\n- Áno.\r\n- Tak mi dajte jednu zelenú sedmu!              ', 88, 3.6, 41),
	(9493, '- Pán hlavný, v polievke mi pláva mŕtva mucha.\r\n- Prosím vás, ako môže plávať,  keď je mŕtva.              ', 119, 3.5, 41),
	(9494, '- Odkiaľ si?\r\n- Z Košíc...\r\n- A z ktorej časti?\r\n- Celý z Košíc...              ', 87, 3, 41),
	(9495, '- Do you speak english?\r\n- Že čo?\r\n- Či hovoríš po anglicky?\r\n- Jasné, perfektne!               ', 102, 3.17, 41),
	(9496, 'Vraví pán pri pokladni predavačke:\r\n- Slečna, vy ste sa splietla o 250 korún!\r\n- To ste mal povedať hneď, teraz už je neskoro.\r\n- Čo sa dá robiť, tak si ich nechám.              ', 190, 3.67, 41),
	(9497, 'Idú futbalisti na zájazd poschodovým autobusom. Hráči dole sa veselo bavia, odrazu si všimnú, že hore je podozrivo ticho. Jeden z nich sa tam ide pozrieť a vidí, že tam všetci sedia ako prikovaní, držia sa sedadiel a vydesene čumia pred seba.\r\n- Čo se deje? - pýta sa prekvapene.\r\n- Vám dole je hej, vy tam máte vodiča!              ', 353, 3.4, 41),
	(9498, 'Sedí chlapík na konári a píli ho pod sebou. Ide okolo babka a hovorí mu: "Synak, nepíľ pod sebou ten konár, spadneš." "Ale babka, nebojte sa, nespadnem," odpovedá chlapík. No o chvíľu na to, ako babka odíde, chlapík spadne, hneď beží za babkou a prosí ju: "Babka, vyveštite mi ešte niečo..."              ', 327, 3.2, 41),
	(9499, 'Kabeš s manželkou sedia chvíľu na predstavení Labutieho jazera. Pani Kabešová sa nakloní k manželovi a pýta sa:\r\n - Prečo tam tie ženy stále chodia po špičkách?\r\n- To vieš, je to balet o labutiach, určite je tam nasrané...              ', 255, 4.07, 41),
	(9500, '"Strážmajster, keď ste zastavili obvineného, boli vaše modré a červené majáky v činnosti?" "Áno." "Povedal obvinený niečo, keď vystúpil z auta?" "Áno, pane." Čo povedal?" "Čo je to tu za diskotéku?"\n', 218, 3.2, 41),
	(9501, 'Majster pozerá, že mu po stavbe zmätene chodí robotník, a tak za ním ide a pýta sa, čo robí. A on na to: \r\n- Hľadám hranol 20 na 20. Majster vraví, že mu pomôže. Hľadajú, hľadajú a zbadá ich stavbyvedúci. Hneď sa ide spýtať, čo robia. Majster mu povie: \r\n- Tuto Ferko hľadá hranol 20 na 20. A tak stavbyvedúci tiež pomáha hľadať. Keď ten hranol stále nemôžu nájsť, zrazu Ferko povie: \r\n- Viete čo, chlapi? Kašlite na to, ja si sadnem na guľatinu.              ', 501, 4.06, 41),
	(9502, 'Vojde Ďuro do baru, v ruke má hovno a hovorí: \r\n"Chlapi, pozrite do čoho som skoro stúpil!"              ', 110, 4.28, 41),
	(9503, 'Policajt zastaví mladú vodičku:\r\n- Vy neviete, čo znamená tamtá dopravná značka?\r\n- Neviem, ale spýtajte sa tamto v trafike, ten dedko vie všetko možné.              ', 178, 4.17, 41),
	(9504, 'Partia chlapov nosí na stavbe dosky po troch, ale Dežo iba po jednej. Majster na neho volá: \r\n„Dežo, prečo aj ty nenosíš po tri dosky ako ostatní?" \r\n„Majster, ja za to nemôžem, že oni sú leniví chodiť trikrát."              ', 244, 3.88, 41),
	(9505, '„Pozri drahý, opäť letí tá strieborná aeroplána!" \r\n„To nie je aeroplána, ale aeroplán." \r\n„Ach, drahý, aké ty máš dobré oči!"              ', 161, 3.8, 41),
	(9506, '"Pán vrchný, dal by som si to, čo má tá pani pri tamtom stole." Vrchný sa po chvíli vráti: \r\n"Prepáčte, pane, ale budete si musieť objednať niečo iné, tá pani to chce zjesť celé sama."              ', 215, 3.84, 41),
	(9507, 'Ako pripravíme rýchle občerstvenie?\r\n- Nečakanú návštevu usadíme v obývačke a otvoríme okno.              ', 117, 2.88, 41),
	(9508, 'Letí lietadlo. Pilot prijíma hlásenie z letiska: \r\n- Nahláste vašu výšku a polohu. \r\n- 180 cm, prvé sedadlo.              ', 130, 4, 41),
	(9509, 'Doktor požiadal sestru, ktorá bola tak trochu duchom neprítomná, aby vzala pacientovi na trinástke krv. Sestra sa vrátila asi tak o pol hodiny a vraví: \r\n"Pán doktor, asi sa budete hnevať, ale viac ako šesť litrov som z neho nedostala."              ', 261, 4, 41),
	(9510, 'Američan, Čech a Indián sa navzájom presviedčajú, že skočia z mrakodrapu. Vyjdú po schodoch hore, prvý sa pozrie dole Američan a vraví: \r\n"No, no!" \r\nAko druhý sa díva dole Indián, chvíľku premýšľa a tiež odmieta: \r\n"Vata, vata!" \r\nČech sa bez rozmýšľania rozbehne a skočí dole. Ostatní dvaja sa idú pozrieť, čo sa s ním stalo a nájdu ho rozplesknutého na zemi. Čech zdvihne hlavu a povie: \r\n"Hovno vata, betón!!"              ', 463, 3.99, 41),
	(9511, 'Uprostred tajgy, asi 2000 km východne od Moskvy, sedia dvaja drevorubači a desiatujú. Jeden z nich medzi jedlom vraví: \r\n"Počul som, že v Los Angeles si drevorubač za mesiac zarobí na auto." \r\n"A kde to je, to Los Angeles?" \r\n"Ešte asi 8000 km na východ." \r\n"Hm, čo s autom v takej diere?"\n', 301, 4.16, 41),
	(9512, 'Hviezda univerzitného rugbyového mužstva skladá skúšku z matematiky. Tréner sedí v poslednej lavici a drží palce. Profesor preukazuje veľké pochopenie:\r\n- Povedzte mi, koľko je osemkrát sedem?\r\nŠtudent pohotovo odpovedá:\r\n- Päťdesiat!\r\nProfesor zúfalo pozrie na trénera.\r\n- Pán profesor, - hovorí tréner, - prižmúrte jedno oko, veď sa pomýlil len o dve...              ', 396, 2.75, 41),
	(9513, 'Policajt zastaví vodičku v jednosmernej uličke:\r\n- Toto je jednosmerka, tu sa môže jazdiť len jedným smerom.\r\n- No a? Vari som išla obojsmerne?              ', 165, 3.67, 41),
	(9514, 'Prijmeme analfabeta pre triedenie prísne tajnej dokumentácie.              ', 77, 4, 41),
	(9515, 'Príde maník do tetovacej dielne a hovorí:\r\n- Mohli by ste mi na chrbát vytetovať tank?\r\n- Jasné...\r\nPo dvoch minútach práce tetovač hovorí:\r\n- Tak, hotovo!\r\n- Za dve minúty?\r\n- Veď to boli len 4 písmená...              ', 233, 4, 41),
	(9516, 'V blate pri ceste stojí auto, vedľa leží chlap tvárou v blate a hrabe sa von. Ide okolo občan a pýta sa policajta:\r\n- Čo sa tu stalo?\r\n- Ale nič, tento pán hovoril, že mu neštartuje auto, aby som do neho strčil...              ', 240, 3.5, 41),
	(9517, 'Vyjde sedliak s kombajnom na pole. Buchne sa dlaňou do čela a hovorí:\r\n"Ej doriti, však ja som zabudol zasiať!"              ', 130, 4, 41),
	(9518, 'Mafián zastaví na pumpe a číta si návod na stojane:\r\n"Vezmite do ruky pištoľ...," vytiahne svoju šesťtridsaťpäťku...\r\n"Vložte ju do plniaceho hrdla nádrže...," teda, keď vložiť, tak vložiť.\r\n"Stlačte..."\n', 225, 3.89, 41),
	(9519, 'Starší pán sedí v obyvačke, pozerá zaujímavý futbalový zápas a zrazu niekto zaklope. Pristúpi k dverám a pýta sa:\r\n- Kto je?\r\nSpoza dverí sa ozve:\r\n- Jean Claude van Damme.\r\nChlapík nahnevaný zreve:\r\n- Páľte do riti všetci štyria!              ', 264, 4.14, 41),
	(9520, 'Zhovárajú sa dve ženy:\r\n- Tá moja dcéra má šťastie. Včera uzavrel zať úrazové poistenie, a už dnes ho zrazilo auto!              ', 142, 3.33, 41),
	(9521, 'Lekár sa pýta pacienta s obviazanou hlavou: \r\n- Autonehoda?\r\n- Nie, maharadža.               ', 96, 3.8, 41),
	(9522, 'Poznámka v denníku miliardára:\r\n„Nabudúce, keď manželka povie: "treba kúpiť čínu", znamená to jedlo!"\n', 115, 3.92, 41),
	(9523, 'Pýta sa farmár kovboja:\r\n"John, označil si včera všetky zvieratá, ako som ti predvčerom prikázal?"\r\n"Označil."\r\n"A mal si s tým veľa roboty?"\r\n"S dobytkom ani nie, ale s tými včelami to bolo strašné."              ', 229, 3.8, 41),
	(9524, 'Čašník ponúka hosťovi:\r\n- Mám bravčovú pečeň, teľacie srdce, hovädzí  jazyk, údené kolena, volské oko...\r\nHosť ho zarazí:\r\n- Vaše telesné problémy  ma nezaujímajú, prineste mi guláš.              ', 221, 4, 41),
	(9525, 'Lietadlo už malo každú chvíľu odštartovať, ale v poslednej chvíli sa vrátilo. Po hodine čakania konečne zase vyrolovalo a vzlietlo. Jeden cestujúci sa pýta stewardky:\r\n- Slečna, neviete, prečo sme sa hodinu zdržali?\r\n- Viem. Pilotovi sa nezdal zvuk pravého motora a hodinu trvalo, kým sme zohnali iného pilota.              ', 343, 3.69, 41),
	(9526, '”Pán hlavný, prečo máte na stoloch umelé kvety?”\r\n”Pretože my sme vegetariánska reštaurácia, viete?”              ', 131, 2.8, 41),
	(9527, '”Prečo držíš tú sliepku tak dlho za krk?”\r\n”Varím podľa kuchárskej knihy. Tam je napísané: Sliepku pol hodiny mierne dusíme.”              ', 158, 3.8, 41),
	(9528, 'V hotelovej recepcii zvoní telefón, a keď ho recepčná zdvihne, ozve sa nespokojný hlas lorda Gregora:\r\n“Buďte taká láskavá a prideľte mi inú izbu, v tejto horí.”              ', 192, 3.44, 41),
	(9529, 'Príde chlapík domov a hneď za dverami cíti, že to nie je ono, že by to niečo chcelo. \r\n”Ahá, napiť som sa chcel”, napije sa, ale ani to nie je ono. \r\n”Už viem, mám hlad”, naje sa, ale stále má pocit, že to akosi nie je ono. \r\n”Vykúpem sa, dám si cigaretku”. Vykúpe sa, vylezie z vane, osuší sa a keď už siaha po cigaretách, tak sa pleskne do čela: \r\n”Už viem! Lyže som si chcel vyzuť!!!”              ', 443, 3.9, 41),
	(9530, 'V autobuse hovorí babka feťákovi:\r\n- Nože mi predierkuj lístok, synak.\r\nFeťák sa otočí, zbadá vojaka a vraví mu:\r\n- Vojačik, predierkuj babke lístok.\r\n- Ja nie som vojak, ja som námorník.\r\nFeťák sa otočí naspäť k babke a kričí:\r\n- Ej babka, zle je. My sme na lodi.              ', 301, 3.69, 41),
	(9531, 'Psychiater si pozval pani Novákovú:\r\n- Váš manžel ma požiadal, aby som vás vyšetril. Vraj večer chodíte po byte so zdvihnutými rukami a roztiahnutými prstami. Môžete mi k tomu niečo povedať?\r\n- Ale samozrejme. Čakám až mi uschne lak na nechty.              ', 276, 3.78, 41),
	(9532, 'Dvaja kamaráti sa rozprávajú:\r\n- Ráno vstanem, idem do kúpeľne, že sa oholím. Pozriem sa do zrkadla a v hlave obrovská diera!\r\n- Človeče, hrôza. A čo si urobil?\r\n- Zavrel som ústa a diera zmizla.\n', 210, 3.93, 41),
	(9533, 'Ide jeptiška autobusom, na ruke má sadru. Prisadne si k nej kňaz a pýta sa:\r\n"Čo sa vám stalo?"\r\n"Spadla som vo vani."\r\nZa nimi idú dvaja somráci a jeden sa pýta druhého:\r\n"Čo je to vaňa?"\r\n"Neviem, ja nie som katolík!"\n', 233, 3.6, 41),
	(9534, 'Ide dedo na bicykli a vôbec nešlape. Pozorujú ho dva policajti a keď už ide dlhšiu dobu do kopca, zastaví ho a spýtajú sa:\r\n"Ako to, že idete na bicykli a nemusíte šlapať?"\r\n"Viete, mňa tlačia topánky."\n', 219, 3.6, 41),
	(9535, 'Po koncoročnom vysvedčení sa zídu traja žiaci, ktorí prepadli z biológie a nadávajú na učiteľku. Potom prejdú k tomu, že by jej mohli niečo urobiť.\r\nPrvý hovorí:\r\n"Ja ju vylákam do lesa."\r\nDruhý hovorí:\r\n"Ja ju zvalím na zem."\r\nTretí hovorí:\r\n"A ja ju nakopem do gulí."\n', 294, 3.56, 41),
	(9536, 'Teplý sedí v kostole a okolo ide pomocník farára a máva kadidlom. Prejde raz, dvakrát a po tretíkrát to buzík už nevydrží a hovorí:\r\n"Bacha, horí ti kabelka!"\n', 173, 3.55, 41),
	(9537, 'Rozprávajú sa dve pani:\r\n"Viete, že včera prešli vo vedľajšej  ulici kominára?"\r\n"To je ale hrozné. Dnes už si človek nemôže byť istý pred autami ani na streche."\n', 178, 3, 41),
	(9538, 'Stretnú sa dvaja susedia a jeden sa pýta:\r\n"Mal by si radšej týfus alebo milión korún?"\r\n"To sú mi ale blbé otázky."\r\n"Možno sa ti zdajú blbé, ale odpovedz mi."\r\n"No to je jasné, že radšej ten milión korún!"\r\n"Tak vidíš, aký si blbý. Milionár musí umrieť každý, ale z chorých na týfus zomiera len asi 30 percent."\n', 342, 3.25, 41),
	(9539, 'Maliarsky majster hovorí svojmu učňovi:\r\n"Choď do vedľajšej miestnosti a natri okná."\r\nUčeň sa po chvíli vráti, otvorí dvere a pýta sa:\r\n"Pán majster, aj rámy?"\n', 176, 3.33, 41),
	(9540, 'Pani Mrkvová budí v noci zúfale svojho manžela:\r\n"Jaro, vstávaj! Zabudol si si večer vziať prášky na spanie!"\n', 119, 3.86, 41),
	(9541, 'Stojí chlapík pred barákom pri cirkulárke a reže na nej psa. Vykukne z okna sused, totálne šokovaný a pýta sa:\r\n"Sakra, čo to robíte??"\r\n"Vidíte, nie? Psie kusy."\n', 175, 2.75, 41),
	(9542, 'Pračlovek chodí po jaskyni a naštvane vraví:\r\n"Mám zlú náladu, idem zabiť mamuta."\r\n"Ale starý, na to nestačíš sám."\r\n"Máš pravdu, tak to mu musím aspoň nafackať."\n', 182, 2.83, 41),
	(9543, 'Gorbačov sa raz veľmi ponáhľal. Povedal teda šoférovi, aby si sadol dozadu, že bude riadiť. Cestou prefrčal okolo 2 policajtov. Jeden za ním hneď vyrazil. \r\nNeskôr sa vrátil ku kolegovi:\r\n"Dal si mu pokutu?"\r\n"Nie."\r\n"Ako to? \r\n"Bol  to niekto veľmi vysoko."\r\n"Kto to bol?"\r\n"Neviem, ale jeho vodič bol Gorbačov."\n', 330, 3.67, 41),
	(9544, 'Na ostrove stojí zarastený muž a máva rukami na plávajúcu loď. \r\n"Kto je to?" pýta sa pasažier kapitána.\r\n"Neviem, ale vždy sa tak raduje, keď plávame okolo."\n', 172, 3.69, 41),
	(9545, 'Za autobusom beží chlap. Autobus zastaví na zastávke a chlap tiež zastaví. Autobus sa rozbehne a chlap zas za ním. Z autobusu ho pozoruje babka. Keď vystúpi, pýta sa ho:\r\n"Prosím Vás, prečo bežíte a nenastúpite?"\r\n"Takto ušetrím 10 korún."\r\n"A prečo teda nebežíte za taxíkom, ušetril by ste 100 korún."\n', 328, 4, 41),
	(9546, 'Sedí žaba na studni. Okolo ide princ a počuje žabu volať:\r\n"Ak ma pobozkáš, niečo dostaneš."\r\nPrinc neváha a žabu pobozká. Tá okamžite reaguje:\r\n"Dostaneš ekzém."\n', 179, 3.5, 41),
	(9547, 'Celý deň som sedel vo vyšetrovacej väzbe. Také idiotské heslo na vkladnú knižku: peniaze alebo život si mohla vymyslieť len ty!                         \n', 163, 3.86, 41),
	(9548, 'Slovák v českom bare:\r\n- Jednu whisky! \r\n- Skotskou?\r\n- Nie, bez kocky!              ', 87, 3.84, 41),
	(9549, 'Do trafiky pribehne chlapík a zavreští: \r\n- Zápalky!\r\n- Nekričte na mňa, nie som hluchá! \r\n- S filtrom, alebo bez?              ', 135, 3, 41),
	(9550, '"Pán doktor, svrbí ma komplet celé telo." \r\n"Skúšali ste sprchu?" \r\n"Jasné, dva-tri týždne bol pokoj, ale zasa to začalo!"              ', 145, 3.7, 41),
	(9551, 'Astronauti stoja na Mesiaci pred raketou a pozerajú bezradne na seba. Po dlhej chvíli sa jeden ozve:\r\n- No nekukaj tak na mňa, ja som nezamykal!              ', 161, 3.4, 41),
	(9552, 'Havária autobusu, veľa ranených, len šoférovi sa nič nestalo. Pýtajú sa ho:\r\n- Čo sa stalo? \r\n- No ja neviem, ja som vzadu štikal lístky...              ', 164, 4.07, 41),
	(9553, 'Pani sa pýta suseda:\r\n- Čo si myslíte, prestane pršať?\r\n- Určite, doteraz vždy prestalo.\n', 96, 4.18, 41),
	(9554, 'Novák predáva noviny, keď tu sa pri ňom pristaví známy:\r\n- Počuj, požičaj mi do zajtra 1.000 korún.\r\n- Nemôžem, mám takú dohodu tuto s bankou oproti.\r\n- Akú dohodu môže mať taký chudák ako ty s bankou?\r\n- Dohodli sme sa, že oni nebudú predávať noviny a ja nebudem poskytovať pôžičky.\n', 312, 3.5, 41),
	(9555, 'Vyjde kovboj pred saloon, odhrnie koňovi chvost a pobozká ho priamo na zadok. Ostatní kovboji sa naňho s údivom pozerajú a jeden sa ho pýta:\r\n“Prečo bozkávaš tomu koňovi riť?“\r\n“Mám popraskané pery.“\r\n“A pomáha to?“\r\n“Nie, ale aspoň si ich menej oblizujem.“\n', 290, 3.97, 41),
	(9556, 'Slúžka našla pod posteľou prezervatív. Išla za paniou a hovorí jej: \r\n- Pani moja, toto som našla pod posteľou, čo je to?\r\n- Marka, a vy sa na dedine nemilujete?\r\n- To hej, ale nie až tak, aby kožka zišla...              ', 234, 3.93, 41),
	(9557, 'Policajt zastavil sedliaka, ktorý vezie veľkú fúru.\r\n- Čo to veziete? - pýta sa.\r\nSedliak sa k nemu nakloní a pošepká:\r\n- Seno.\r\n- A prečo šepkáte? - čuduje sa policajt.\r\n- Aby kone nepýtali.\n', 206, 3.25, 41),
	(9558, 'Dvaja policajti sa rozprávajú:\r\n- Čo používaš ako ochranu proti Aids?\r\n- Samozrejme primeros. Vždy ho mám na sebe.\r\n- A nikdy ho nedávaš dole?\r\n- Zriedka, len keď močím alebo sa milujem.              ', 213, 4, 41),
	(9559, 'Výstava avantgardného umenia. Jeden z obrazov je vlastne iba holý rám a pri ňom je nálepka s nápisom "Kravy na paši".\r\n- A kde je vlastne tá paša? - pýta sa jeden návštevník autora.\r\n- Zožrali ju kravy. - odvetí autor obrazu.\r\n- A kde sú tie kravy.\r\n- Keď už nebolo čo jesť, tak išli preč.		              ', 328, 4.24, 41),
	(9560, 'Príde chlap k lekárovi a hovorí:\r\n- Som desať rokov ženatý a z toho deväť rokov ma žena podvádza. Prečo mi ešte nenarástli parohy?\r\n- Ale veď to sa len tak hovorí, v skutočnosti vám parohy nenarastú.\r\n- Chválabohu, už som si myslel, že mám nedostatok vápnika.              ', 296, 3.88, 41),
	(9561, 'Stretnú sa dvaja známi a jeden vraví:\r\n"Včera som vyhral druhú cenu v tombole."\r\n"Nehovor! A čo si vyhral?"\r\n"Škodovku."\r\n"A čo bola prvá cena?"\r\n"Košík tropického ovocia."              ', 198, 2.67, 41),
	(9562, '"Prosím vás, nevideli ste tu niekde môjho čuvača? Taký väčší, hnedý..."\r\n"Prepáčte, ja sa v autách nevyznám."              ', 138, 4, 41),
	(9563, 'Príde žena do väzenia a hovorí bacharovi:\r\n"Nemohli by ste môjmu mužovi dať nejakú ľahšiu prácu?"\r\n"Myslíte pani, že nalepovanie známok je ťažká práca?\r\n"Nalepovanie? Mne hovoril, že kope tunel."              ', 228, 3.5, 41),
	(9564, 'Móric z Dežom sú v divadle. Zrazu si Dežo musí odskočiť, a tak sa prederie cez rad sedadiel von. Keď sa vráti, pýta sa Mórica:\r\n"Tak ako, čo sa tam zatiaľ udialo?"\r\n"Ale, dohromady nič. Grófka si sadla na pohovku, potom si prišiel na scénu ty, vymočil si sa do vázy a odišiel si."              ', 314, 3.7, 41),
	(9565, 'Muž volá požiarnikom:\r\n"Horí mi dom! Horí mi dom!"\r\nPožiarnik hovorí:\r\n"Dobre, dobre, hneď tam budeme. A ako sa tam dostaneme?"\r\nMuž trochu zmätene povie:\r\n"Už nemáte tie veľké červené autá?"              ', 222, 3.83, 41),
	(9566, 'Muž navštívil vešticu a tá mu povedala, že kvôli nemu zomrú milióny ludí. Neštastný sa teda chcel hodiť pod vlak. Zrazu vidí chlapčeka, ktorého ide zraziť vlak.\r\n- Urobím aspoň jeden dobrý skutok, povedal a zachránil ho. \r\nPotom sa ho pýta: Ako sa voláš, chlapček?? Adolf Hitler.              ', 318, 3.87, 41),
	(9567, 'Dora ide večer po parku a zrazu začuje výkrik: \r\n- Stoj!! \r\nZostane teda celkom vystrašená stáť. Na to zaznie: \r\n- Ľahni!! \r\nDora si teda ľahne a pripravuje sa na ťažký osud znásilnenej ženy. Na to sa z blízkej tmy ozve: \r\n- Je vám niečo? Cvičím tu psa, keď som vás tu našiel ležať... \n', 310, 3.91, 41),
	(9568, 'Fero kričí na Anču:\r\n”Anča, poď skratkou cez les.”\r\n”Nemám čas, ponáhľam sa.”               ', 109, 4, 41),
	(9569, 'Lekár hovorí pacientke:\r\n”Napísal som vám recept, pani.”\r\n”Ach, pán doktor, vy taktiež rád varíte? ”              ', 130, 4.09, 41),
	(9570, 'Lekár sa pýta mladej ošetrovateľky:\r\n”Kde je pacient z izby číslo sedem?”\r\n”Mal teplotu, preto som ho dala k dievčine, ktorá sa triasla od zimy...”              ', 177, 3.63, 41),
	(9571, 'Príde bezdomovec do bufetu a vidí tam chlapa, ako sedí, pred ním polievka, ešte sa z nej parí, pred sebou má noviny, tak si vraví, že to využije a rýchlo polievku zje. Ako už tak dojedá, na spodku taniera zbadá hrebeň plný vlasov, príde mu z toho zle, tak sa povracia naspäť do taniera. A ten pán spoza tých novín sa nakloní a vraví: ”Aj vy ste našli ten hrebeň?!”               ', 409, 4.22, 41),
	(9572, 'Fero sa pýta kamaráta:\r\n”Jožo, prečo namáčaš tu stenu?”\r\n”Lekár mi vravel, že si mám dávať obklady na miesta, kde som sa udrel.”              ', 162, 2.73, 41),
	(9573, 'Letí lietadlo v hmle a odrazu bum a prestanú fungovať všetky prístroje. Pilot sa začne modliť, keď sa v hmle objaví mrakodrap, v ktorom svieti iba jedno poschodie. Začne teda krúžiť okolo a premýšľa, čo ďalej. Vykloní sa z okienka a zavolá: "Kde to som?" Z okna sa vykloní chlap a odpovie: \r\n"V lietadle!" Pilot vzápätí bezchybne pristane. Kopilot sa zamyslí a pýta sa, ako vďaka takej debilnej odpovedi dokázal tak skvele pristáť. "Jednoducho," odpovie pilot. "Na úplne jasnú, presnú a jednoznačne položenú otázku som dostal úplne správnu a jednoznačnú odpoveď, ktorá mi ale bola na nič. Podľa toho som poznal, že som pri hotline Microsotfu a tam je letisko za rohom."              ', 729, 3.97, 41),
	(9574, 'Chlapík vo vlaku sa pýta sprievodcu, kedy ten vlak zastaví Koniarovciach.\r\n - Pane, toto je expres, ten v Koniarovciach nestojí. \r\n- Vy si robíte srandu, nie? Ja nutne musím vystúpiť v Koniarovciach! \r\n- Je mi ľúto, pane, ale tento vlak tam nestojí. \r\n- Musí predsa byť nejaká možnosť. \r\n- No, jedna by tu bola. Môžem povedať strojvedúcemu, aby spomalil, a ja vás podržím nad nástupišťom a dostanem dolu. \r\n- To znie šialene. Bude to fungovať? \r\n- No, stojí to za pokus. \r\nVlak teda vchádza do stanice, sprievodca drží chlapa za sako vo vzduchu. Chlapík vo vzduchu uteká. Sprievodca ho pomaly spúšťa nižšie, až sa chlapíkove nohy dotknú nástupišťa. Kmitajú sa neuveriteľnou rýchlosťou. Sprievodca ho spúšťa, chlap pomaly stráca na rýchlosti. Už to nie je šprint, ale normálny svižný beh. Keď chlapíka stretá koniec vlaku, z posledných dverí sa niekto vykloní, schmatne ho za límec saka, vtiahne do vlaku a povie: \r\n- Chlape, máte šťastie, že som tu práve stál. Tento vlak tu totiž nestojí!              ', 1077, 4, 41),
	(9575, 'Na brale nad oceánom stoja Američan, Rus, Čech a Slovák. Zrazu sa pred nimi zjaví démon\r\na hovorí Američanovi:\r\nD: „Skoč!"\r\nA: „Čo ti šibe..."\r\nD: „Dostaneš za to milión dolárov a celý svet bude o tebe rozprávať."\r\nA: „Super!" a šup už bol dole.\r\nDémon hovorí Rusovi:\r\nD: „Skoč aj ty, aj tebe dám milión a budeš slávny."\r\nR: „Na to ti kašlem. ZA RODINU, ZA VLASŤ!" šup a už bol dole.\r\nČech nad tým nechápavo krúti hlavou a pozerá sa ako sa Rus strepal dole.\r\nDémon mu hovorí:\r\nD: „Skoč aj ty. Za rodinu za vlasť."\r\nČ: „Nie, nechcem sa zabiť."\r\nD: „Ale je to zadarmo..."\r\nČ: „No to si mal skôr povedať!" šup a už bol dole.\r\nSlováčisko len pozerá a démon mu hovorí:\r\nD: „Skoč, dostaneš milión dolárov."\r\nS: „A čo..."\r\nD: „Tak to urob pre slávu svojej krajiny."\r\nS: „???"\r\nD: „Veď je to celé zadarmo..."\r\nS: „No a?"\r\nD: „Takže neskočíš," rezignuje démon.\r\nS: „Čože?!!"\r\nD: „Že neskočíš."\r\nS: „TAK JA ŽE NESKOČÍM?!!!" šup a už bol dole.              ', 1061, 3.92, 41),
	(9576, 'Veliteľ policajnej zásahovky dostane vysielačkou správu o prepadnutí banky práve, keď sa dostane do dopravnej zápchy. Chvíľu nadáva a potom do vysielačky nariadi svojmu zástupcovi, nech robí, čo môže. Asi po polhodine sa mu podarí vymaniť zo zápchy a dorazí na miesto činu. Je veľmi milo prekvapený, pretože zajatých lupičov práve nakladali do auta. Zájde teda za svojim zástupcom a pýta sa, ako je možné, že to tak rýchlo dokázali. Ten sa na chvíľu zamyslí a hovorí: \r\n"Je to zaujímavé, ale akonáhle sme im postrieľali všetkých rukojemníkov, tak sa sami vzdali."              ', 624, 3.92, 41),
	(9577, 'Príde chlapík do baru. Po ľavej ruke má krásnu blondínku, po pravej krásnu brunetku a na ramene mu sedí havran. Poprosí si dva rumy. Jeden vypije sám, druhý dá havranovi a ten ho do seba kopne. Takto sa to opakuje asi päťkrát a havran je stále OK. Barmanovi to nedá a pýta sa, čo je to za vtáka. \r\n- To viete - hovorí chlapík - som rybár. Raz som chytil zlatú rybku a že ak ju pustím, splní mi tri želania. Tak som chcel krásnu blondínku. To je tá naľavo. Potom som chcel krásnu brunetku. To je tá napravo. No, a nakoniec som chcel vtáka, ktorý veľa vydrží.              ', 610, 4.22, 41),
	(9578, 'Na výletnej lodi je zamestnaný kúzelník na zabávanie cestujúcich. Keďže cestujúci sú stále iní, kúzelník používa stále tie isté triky. Avšak kapitánov papagáj vždy počas predstavenia vykrikuje a prezrádza kúzla. Lenže je to kapitánov papagáj, tak mu kúzelník nemôže nič povedať. Jedného krásneho dňa sa loď potopí a na jednom kuse dreva sa zachránia kúzelník a papagáj. Tri dni sa na seba nenávistne pozerajú a nakoniec na tretí deň to papagáj nevydrží a hovorí:\r\n- OK. Vzdávam sa, kde je loď?              ', 560, 4.11, 41),
	(9579, 'Manžel sa vráti predčasne zo služobnej cesty. Manželka má doma troch milencov. Aby neupadla do manželovho podozrenia, že ho podvádza, skryje ich do vriec na balkóne. Manžel pri večeri porozpráva svojej milovanej žene\r\ndojmy zo služobnej cesty a po nej si ide zafajčiť na balkón. Tu zbadá tri vrecia.\r\nKopne do prvého a ozve sa "kot, kot, dák." Kopne do druhého a ozve sa "mé, mé." Kopne do tretieho a nič. Kopne ešte raz, no opäť nič. Naserie sa a kope do vreca z celej sily. V tom sa ozve:\r\n- Au! Čo toľko kopeš? Keď som ticho, tak som asi zemiaky, nie?\n', 588, 4.23, 41),
	(9580, 'Stoja dvaja narkomani na autobusovej zastávke. Príde autobus a jeden sa spytuje:\r\n- Kamoš, aký je to autobus?\r\n- Červený, kamarát môj, červený...\r\n- A číslo? Aké je jeho číslo?\r\n- Čierne, kamarát, čierne...              ', 238, 3, 41),
	(9581, 'Rozprávajú sa dvaja chlapi:\r\n-Vieš ako udržať hlupákav 24hodín v neistote ?\r\n-Neviem.\r\n-Tak zajtra ti to poviem.              ', 133, 4.04, 41),
	(9582, 'Na spiatočnej ceste majú už aj manageri iba jeden lístok, no inžinieri nemajú, čuduj sa svete, žiadny. Jeden z managerov uvidí sprievodcu a zakričí: "Ide sprievodca!" a všetci manageri sa natlačia do WC. Inžinieri pokojne odchádzajú na ďalšie WC.\r\nPosledný z inžinierov, ešte než sa schová, zabúcha managerom na dvere a zvolá: "Cestovný lístok, prosím!"              ', 395, 2.24, 41),
	(9583, 'Cestuje skupina inžinierov so skupinou managerov vo vlaku. Každý manager ma svoj cestovný lístok, inžinieri majú spolu iba jeden. Zrazu jeden z inžinierov zvolá:\r\n"Ide revízor!" a všetci inžinieri sa natlačia do jedného WC. Sprievodca skontroluje lístky managerov a vidí, že dvere na WC sú zamknuté. Zabúcha na dvere  a zavolá: \r\n"Cestovný lístok, prosím!" Z WC sa pod dverami vysunie jeden lístok, sprievodca ho označí a spokojne odchádza.              ', 482, 2.54, 41),
	(9584, 'Vo väznici sa stretnú dvaja muži. Malomocný a koktavý. Ako tak sedia, malomocnému zrazu odpadne ruka. Dvihne ju a vyhodí von oknom. Koktavý: "Z z z...no než sa koktavý vykokce, tak malomocnému odpadne ucho. Opäť si z toho nič nerobí, dvihne ho a vyhodí von oknom. Koktavy zasa Zzzzz....no malomocnému odpadne noha. Dvihne ju a vyhodí von oknom a koktavý na to: "Z z z ZDRHÁŠ?"              ', 411, 3.99, 41),
	(9585, 'Uprostred noci hovorí otec nádejnému zaťovi:\r\n”Chlapče, dohodli sme sa, že mi dcéru privediete domov ešte pred polnocou. Teraz sú tri hodiny ráno a táto dáma nakoniec nie je ani moja dcéra.”              ', 221, 4.07, 41),
	(9586, 'Chlapík tlačí na záchode ako najatý, ide okolo upratovačka, zdá sa jej, že sa zbytočne svieti, tak zhasne. V tom sa ozve strašný rev, tak zase zasvieti:\r\n”A čože tak revete?”\r\n”Fuj, to bol sprostý fór! Už som sa zľakol, že mi vypadli oči!”              ', 280, 4.29, 41),
	(9587, 'Zhovárajú sa Fero a Mišo. Fero hovorí:\r\n”Ráno som šiel po ulici a tu, z ničoho nič ma zasiahla plechovka rovno do hlavy.”\r\n”A čo v nej bolo?”\r\n”Nič.”\r\n”A v plechovke?”              ', 207, 3.6, 41),
	(9588, 'Stretnú sa dvaja:\r\n-Založili sme štyria skupinu.\r\n-A ako sa volá ?\r\n-Trio.\r\n-A kto v nej hrá ?\r\n-Ja a môj brat.\r\n-A koncertovali ste už?\r\n- Hej, veľmi mi tlieskali...              ', 188, 3.6, 41),
	(9589, 'Príde montér na jednotku intenzívnej starostlivosti, rozhliadne sa a chvíľu si priehlada pacientov. Oni samozrejme všetci ležia napojení na prístrojoch. Po chviľke hovorí: "Poriadne sa nadýchnite, budem meniť poistky."              ', 245, 3.94, 41),
	(9590, 'Na psychiatrii:\r\n-Čo si dilino? Načo polievaš tie kvety, keď nemáš v krhle vodu?\r\n-Ty si dilino. Nevidíš,že sú umelé?              ', 142, 4.14, 41),
	(9591, 'Austrálsky vtákopysk loví v jazere a chytí zlatú rybku. Tá mu povie, že ak ju pustí, splní mu jedno veľké želanie.\r\n- Chcem byť človekom - zaželá si vtákopysk.\r\n- Budiž - povie rybka a Austrálii pribudol ďalší hermafrodit.', 244, 3.15, 42),
	(9592, 'Chytí rybár zlatú rybku a rybka mu hovorí:\r\n- Rybár, ak ma pustíš, splním ti dve želania.\r\nRybár sa pozrie na rybku a nahnevane povie: \r\n- Nó hovno, hovno zlatá rybka, veď vždy bývajú tri! Hej, rybka, kde si? A čo tu robia tie dve hovna?', 254, 2.98, 42),
	(9593, 'Skín chytí zlatú rybku. Rybka klasicky ponúka splnenie ľubovoľného želania. Skín na to:\r\n"No len sa neposer!"\r\nA rybka o týždeň pukla...', 148, 3.33, 42),
	(9594, 'Rybár vytiahne z vody zlatú rybku druhej triedy. Ona mu vraví:\r\n- Pusť ma a splním ti jedno želanie!\r\n- Prečo jedno?\r\n- Pretože som rybka druhej triedy.\r\n- Nechcem, aby na svete boli vojny!\r\n- Je to ťažké, lebo ja som rybka druhej triedy a takéto želania ja plniť nemôžem.\r\nOn vytiahne fotku svojej ženy a dá ju rybke medzi plutvičky.\r\n- Tak potom urob, aby bola moja žena krásavica.\r\nOna sa pozrie a vraví:\r\n- Vieš čo? Beriem ten celosvetový mier!', 473, 3.14, 42),
	(9595, '- Ahoj Ďuro, kde si bol včera večer?\r\n- Na rybách.\r\n- Vážne a čo si chytal?\r\n- Kapre.\r\n- Fakt a koľko si ich chytil?\r\n- Ani jedného.\r\n- Ďuro! tak ako vias,že si chytal kapre?', 185, 3.01, 42),
	(9596, '- Včera som chytil rybu ako moja ruka.\r\n- Netáraj, také špinavé ryby neexistujú.', 86, 3.37, 42),
	(9597, 'Správca jazera upozorňuje rybára, že loví na zakázanom mieste. Previnilec sa snaží vykrútiť: \r\n- Ja nelovim, ja učím plávať červíka.\r\nSprávca sa nedá: \r\n- Pokutu zaplatíte aj tak, lebo ako vidím, červík nemá záchrannú vestu!', 249, 3.26, 42),
	(9598, 'Traja stroskotanci na pustom ostrove ulovia zlatú rybku, ktorá im hovorí :\r\n- Keď má pustíte, splním každému jedno želanie.\r\nPustia ju a prvý hovorí:\r\n- Ja chcem, aby si postavila veľký most, po ktorom sa dostanem na pevninu.\r\nRybka vykonala. Druhý hovorí:\r\n- Ja chcem veľký balón, v ktorom doletím až na pevninu.\r\nRybka vykonala. A tretí hovorí:\r\n- Čo tu budem sám? Nech sa vrátia!', 408, 3.33, 42),
	(9599, 'Dežo ide chytať ryby. Po dlhom čase sa mu podarí chytiť zlatú rybku. Dežo zahodí rybku a vraví si:\r\n- Zase zlatá, kto to má stále jesť.', 148, 3.13, 42),
	(9600, '- Prečo si nervózny?\r\n- Lebo chytám ryby.\r\n- Ale ja som počula, že to upokojuje.\r\n- To áno, ale nie bez rybárskeho lístka.', 130, 3.03, 42),
	(9601, 'Na brehu mora stojí dáma v zrelom veku so svojim kocúrom, keď v tom sa vynorí zlata rybka a hovorí jej: \r\n- Splním ti tri želania.\r\nDáma sa zamyslí a povie: \r\n- Chcem byť krásna, bohatá a z tohto starého kocúra urob atraktívneho mladého muža.\r\nRybka želania splní, odpláva, ten atraktívny muž sa otočí k svojej spoločnícke a pýta sa: \r\n- Nie je vám teraz ľúto, že ste ma nechali pred dvomi rokmi vykastrovať?', 441, 3.24, 42),
	(9602, 'Čo je maximálny dážď?\r\nKeď môžeš zobrať svoju rybku na prechádzku.', 77, 3, 42),
	(9603, 'Policajt prichytí na potoku pytliaka, ako chytá chránených rakov:\r\n- Tak to  bude riadna pokuta!\r\n- Aká pokuta? - čuduje sa pytliak. Veď som nič neurobil. Tieto dva raky sú moju miláčikovia a ja som s nimi na prechádzke.\r\n- Nevymýšľajte!\r\n- Je to pravda! Pustím ich, aby si zaplávali a keď zapískam, tak sa vrátia.\r\n- No to chcem teda vidieť! -  povie pochybovačne policajt.\r\nMuž teda hodí obidva raky do vody.\r\n- Fajn. Teraz zapískajte a som zvedavý, či sa tie raky vrátia.\r\n- Raky? - čuduje sa pytliak. - Aké raky?', 546, 3.45, 42),
	(9604, 'Policajt chytí na pláži pytliaka a chce mu dať pokutu za lov homárov bez povolenia. \r\n- Akú pokutu? - začuduje sa pytliak. Veď som nič neurobil. Tieto dva homáre sú moji miláčikovia a ja som s nimi len na prechádzke.\r\n- Nevymýšľajte si - oborí sa naňho policajt. \r\n- Je to pravda - trvá na svojom pytliak. Pustím ich, aby si zaplávali, a keď zapískam, tak sa vrátia.\r\n- No to chcem teda vidieť - povie pochybovačne policajt. \r\nMuž teda hodí obidva homáre do vody. \r\n- Fajn. Teraz zapískajte a som zvedavý, či sa tie homáre vrátia - povie po chvíli policajt. \r\n- Homáre? - začuduje sa pytliak. Aké homáre?', 644, 3.17, 42),
	(9605, 'Sedlák chytil zlatú rybku. \r\n- Prosím ťa, sedlák prosím pusť má!  - prosí zlata rybka - Ak má pustíš na slobodu, splním ti tri želania.\r\nV zápetí sedlák rybku, rozdupe na zemi a hovorí.\r\n- Kua, kto ti je tu sedlák! ', 234, 3.17, 42),
	(9606, 'Viete čo je najväčšia smola? \r\nKeď máte alergiu na zlato a chytíte zlatú rybku.', 87, 3.09, 42),
	(9607, '- Včera som chytil dva metre dlhú šťuku!\r\n- A ja som z vody vytiahol horiacu sviečku!\r\n- Klameš, sviečka vo vode nehorí.\r\n- Ty skráť šťuku, ja zhasnem sviečku!', 172, 3.36, 42),
	(9608, 'Ide rybár a prechádza okolo svojho kolegu. Vedľa druhého rybára na zemi je škatuľa od topánok.\r\n"Čo to tu máte?"\r\n"Pozrite sa do nej."\r\nRybár zdvihne vrchnák a v škatuli je tenis. Centimetrový Agasi, centimetrový Sampras a ľudia otáčajúci hlavou  zo strany na stranu.\r\n"Čo to je?"\r\n"Ale chytil som zlatú rybku a splnila mi želanie."\r\nDruhý rybár si hneď sadne a pokúša sa chytiť zlatú rybku. Odrazu ju chytí a rybka mu hovorí:\r\n"Ak ma pustíš splním ti jedno želanie."\r\n"Dobre chcem kufor plný doláčov."\r\n"O.K."\r\nPustil rybu a na brehu sa objavil kufor. Rybár ho otvoril a zreval:\r\n"Je tá ryba hluchá alebo čo?"\r\n"Myslíte, že ja som chcel  30 cm tenis?"', 696, 3.17, 42),
	(9609, 'Viete čo je úplná smola?\r\nMať alergiu na zlato a chytiť zlatú rybku.', 74, 2.88, 42),
	(9610, 'Rybár uloví zlatú rybku. Bez rozmýšlania ju zvesí z udice a hodí spať do vody. Rybka sa prekvapená vynorí a pýta sa ho:\r\n"A tri želania nebudú?"\r\n"A čo by si chcela?"', 180, 3.22, 42),
	(9611, 'Zlatá rybka a SKINhead.\r\nKeď už SKIN chytil zlatú rybku, tak tá mu hovorí, že mu splní jedno želanie.\r\n"Daj mi pokoj."\r\nA chce ju hodiť naspäť do vody.\r\n"Ale veď som zlatá a splním ti jedno želanie."\r\n"Daj mi pokoj a neotravuj."\r\n"Ale ja ti musím splniť želanie."\r\n"No dobre, len sa neposer."\r\nA rybka o týždeň praskla.', 341, 3.32, 42),
	(9612, 'Viete, ktoré slová má rád žralok plávajúci za loďou?\r\n\'Muž cez palubu!\'', 80, 3.06, 42),
	(9613, 'Prečo chcel rybár, aby ho po smrti spopolnili?\r\nBál sa pomsty červíkov.', 76, 3.23, 42),
	(9614, 'Kovboj chytil zlatú rybku a mu hovorí že mu splní tri želania.Kovboj hovorí 1.želanie:\r\n"Keď prídem do baru chcem vymlátiť všetkých mužov."\r\npo 2:"Keď žmurknem na nejakú babu nech ide so mnou hore a posledné želanie:chcem ho mať takého akého ho má môj koň."\r\nTak kovboj dojde do prvého baru vymláti všetkych mužov,žmurkne na babu,idú hore on sa vyzlečie,baba odpadne.Príde do druhého baru a vymlát i tam všetkých mužov.Žmurkne na babu a idú spolu hore.On sa tam vyzlečie,baba odpadne a kovboj si hovorí:\r\n"Už 30 rokov jazdím na mojom koňovi,až teraz zistím,že je to kobyla."', 622, 3.47, 42),
	(9615, 'Dvaja už ožratý rybári sa rozprávajú na rybačke:\r\n- Počuješ, ako ten kapor pekne spieva?\r\n- Čo ti šibe? Teraz v noci?', 128, 3.18, 42),
	(9616, 'Syn vášnivého rybára príde zo školy domov a hneď vo dverách povie: \r\n- Dnes som v škole dostal takúúúto jednotku!', 125, 2.99, 42),
	(9617, 'Dvaja skúsený rybári sa rozprávajú:\r\n- Ó, ako vidím, chytáte na plesňový syr, takže ste prestaly s červíkmi. \r\n- Nie, oni sú v tom syre.', 150, 3.23, 42),
	(9618, 'Vykukne krokodíl z vody na rybára a pýta sa ho:\r\n- Berú, berú?\r\n- Ale kdeže, ani ťuk...\r\n- Tak sa na to vykašli a poď sa vykúpať.', 140, 3.59, 42),
	(9619, 'Sedliak chytí zlatú rybku a zlatá rybka mu hovorí:\r\n- Sedliak, keď ma pustíš, tak ti splním tri želania.\r\nSedliak chytí zlatú rybku do ruky, začne ňou trieskať o loď a hovorí:\r\n- Ryba, počúvaj, kto ti tu je sedliak?', 233, 3.27, 42),
	(9620, 'Chytí rybár zlatú rybku a tá mu hovorí: \r\n- Splním ti tri želania, ale tvoja svokra dostane dvakrát toľko. \r\nRybár porozmýšľa a povie: \r\n- Chcem obrovský dom s bazénom!\r\nDostane obrovský dom s bazénom, ale svokra dostane dva také domy. \r\n- Chcem milión korún! \r\nDostane milión, ale svokra dva milióny. Rybár sa poškriabe po hlave a hovorí: \r\n- Chcem, aby si ma dobila tak, aby som bol polomŕtvy!', 421, 3.26, 42),
	(9621, '- Pane, tu môžete chytať ryby len na rybársky lístok!\r\n- Prepáčte, myslel som, že na červíka.', 103, 2.94, 42),
	(9622, 'Vyloví rybár zlatú rybku,tá mu hovorí:\r\n- Rybár,ja som zázračná rybka a ak ma pustíš,splním ti jedno želanie.\r\nRybár na to:\r\n- Ja ťa teda pustím,ale ja nepotrebujem splniť želanie,ja som spokojný\r\na nič nepotrebujem. Ale tam na tej lodi spí nejaký námorník,takže ked\r\nsa zobudí, splň jemu, čo bude chcieť.\r\nRyba pripláva k lodi a čaká, kým ten vstane. Námorník sa o chvíľu zobudí a ešte rozospatý naťahujúc sa povie:\r\n- Ej, sto nožov do chrbta a sekeru do hlavy!', 505, 3.5, 42),
	(9623, 'Včasné studené ráno. Rybár stojí po kolená vo vode s udicou. Druhý ide okolo:\r\n"Už dlho chytáš?"\r\n"UHmmmm"\r\n"A berú rybky, berú?"\r\n"UHmmmm"\r\n"A koľko si už chytil?"\r\nTen vypľuje do dlane a hovorí:\r\n"Neotravuj! Nevidíš, že hrejem červíky?"', 260, 3, 42),
	(9624, 'Zlatá rybka chcela odísť na dovolenku a preto poprosila krokodíla, aby ju zastúpil. Krokodíl súhlasil a týždeň zastupoval zlatú rybku.\r\nPo týždni sa rybka vrátila a pýtala sa krokodíla, či mal niekto nejaké želanie.\r\n- Bol tu jeden chlap, a chcel ho mať až po zem.\r\n- A čo si urobil?, pýta sa rybka.\r\n- Odhryzol som mu obe nohy.', 351, 3.29, 42),
	(9625, 'Sedia dvaja rybári na brehu. Zrazu jeden z nich vyberie udicu z vody a začne s ňou mávať. Druhý na to:\r\n- To čo robíš?\r\n- Keď neberú ryby, tak skúsim vtáky!', 169, 3.25, 42),
	(9626, 'Ide napitý Jožo okolo potoka keď v tom počuje, ako niečo na neho kričí zo zeme. Pozrie dolu a vidí zlatú rybku ako ho prosí: \r\n- Prosím ťa, hoď ma do vody a splním ti jedno želanie.\r\nJožko asi po treťom pokuse konečne rybku chytil, hodil ju do vody a odchádza preč. Vtom Rybka pripláva za ním a pýta sa:\r\n- A to želanie?\r\n- Skap!', 353, 3.46, 42),
	(9627, 'Ide rybár okolo jazera a vidí druhého rybára. Pýta sa: \r\n- Tak čo, aká je voda?\r\nA druhý odpovedá: \r\n- Výborná, rybám sa ani nechce von.', 148, 3.11, 42),
	(9628, 'Ide skín po meste a stretne zlatú rybku. Rybka mu hovorí.\r\n"Splním ti jedno želanie."\r\n"Neotravuj!"\r\n"Ale ja strašne chcem", hovorí rybka.\r\n"Ale nechaj ma! Nemám záujem!"\r\nRybka hovorí: \r\n"Ale ja strašne, strašne chcem."\r\n"No dobre, len sa neposer!"\r\n......a rybka za týždeň praskla.', 298, 3.2, 42),
	(9629, 'Rada pre rybárov: Keď chytíte zlatú rybku a ona vám povie že vám splní želania, alebo iba jedno želanie, tak si prajte ďalších nekonečno želaní', 159, 3.35, 42),
	(9630, 'Príde pani do akvaristického obchodu a pýta sa:\r\n-Máte ryby?\r\n- Áno .\r\n- A sú čerstvé...?', 97, 2.86, 42),
	(9631, 'Dvě holky v kině. Jedna se nakloní ke druhé a říká:\r\n"Hele, ten chlápek vedle mně tu onanuje!"\r\n"Kašli na něj, normálně ho ignoruj."\r\n"To nejde, používá mojí ruku."', 181, 3.66, 43),
	(9632, 'V kine:\r\n- Môžem ťa pobozkať?\r\n- Mňa? Veď teraz som ťa vyfajčila.\r\n- Mňa???!!! \n', 89, 3.8, 43),
	(9633, 'Gynekológ sa pýta atraktívnej ženy:\r\n- S koľkými mužmi ste mali pohlavný styk?\r\n- S piatimi alebo šiestimi, ani si to presne nepamätám.\r\n- To nie je zas tak veľa! - odvetí gynekológ.\r\n- Tiež si to myslím. Bol to nevydareny víkend.', 247, 3.83, 43),
	(9634, 'Na ulici zastaví prostitútka dedka a hovorí mu:\r\n- Dedko, chceš si so mnou trochu užiť?\r\nDedko vytiahne 500 korún a podá ich dievčine.\r\n- Dedko, ale veď ešte nič nebolo.\r\n- Za dôveru, dievča, za dôveru.', 217, 3.62, 43),
	(9635, 'Čo má spoločné krátkozraký gynekológ so psom?\r\nObaja majú vlhký nos.', 77, 3.5, 43),
	(9636, 'Viete, aká je najväčšia rýchlosť pri milovaní?\r\nNo predsa 68. Veď pri 69 sa už otáčate! ', 99, 3.27, 43),
	(9637, 'Rozprávajú sa dvaja kamaráti:\r\n- Ako to vyzeráš? Kto ťa tak doriadil?\r\n- Ale, mali sme firemný večierok, tancoval som so svojou sekretárkou a prišla moja manželka.\r\n- No a?\r\n- Nevšimol som si, že už dve hodiny nehrala hudba, lebo vypadol prúd!', 258, 2.8, 43),
	(9638, 'Končí sa firemný večierok a šéf hovorí sekretárke:\r\n- Slečna, odprevadim vás domov.\r\n- Ďakujem, ja chodím domov zásadne sama. Ale ak mi neveríte, poďte so mnou a presvedčte sa.', 192, 3.24, 43),
	(9639, 'Aký je vzťah šéfa a jeho sekretárky?\r\nNajprv mu lezie do postele, potom do peňaženky a nakoniec na nervy.', 112, 3.5, 43),
	(9640, 'Dve dievčatká sa hrajú v parku. Príde ku nim starší ujo a hovorí:\r\n- Ak idete so mnou na lavičku, dám vám každej cukrík\r\nDievčatká idú.\r\n- Ak sa mi posadíte do lona, dám vám každej cukrík\r\nOny sa posadia\r\nAk mi dovolíte položiť vám ruku na kolienko, dostane ďalší cukrík\r\nOny dovolia\r\n- Ak mi dovolíte nadvihnúť vám blúzočku, zasa budú cukríky...\r\n- Ty počuj, radšej poďme preč - povie jedna slečinka druhej - kým nás tento tu pomiluje, zomrieme na cukrovku...', 503, 3.93, 43),
	(9641, 'Vieš ako vzrušíš veľrybu?\r\nZačneš ju mlátiť po klitorise veslom.', 73, 3.59, 43),
	(9642, 'Príde slepec na pláž, vybalí sa a začne si nafukovať "nafukovaciu Anču". Pristúpi k nemu plavčík a hovorí:\r\n- Nepríde vám to blbé ležať na pláži na nafukovacej Anči?\r\n- Do prdele, tak to som sa posledný týždeň miloval s nafukovačkou.', 257, 3.45, 43),
	(9643, 'Ako zbaliť babu:\n\r\nSlečna, bojíte sa búrky?\r\nNie? Fain. Ja ho mám ako hrom.\n\r\nSlečna, vadí vám zvuk motorovej píly?\r\nÁno? Tak Vás \'přežíznu\' klasickým spôsobom.\n\r\nSlečna, nevadí vám prievan.\r\nNie? Tak vám ho tam fuknem.', 239, 3.38, 43),
	(9644, 'Mladému mužovi sa páči pohľadná dievčina:\r\n- Slečna, dáte si so mnou kávu?\r\n- Prepáčte, ale mám menštruáciu.', 123, 3.46, 43),
	(9645, '- Môj syn prosí o ruku vašej dcéry.\r\n- A čo, váš syn nemá ruky?\r\n- Má, ale už veľmi unavené!', 104, 3.53, 43),
	(9646, 'Rozprávajú sa dvaja:\r\n- Ja mám rád sex najradšej večer. Po celodennej drine sa príjemne dorazím a zaspím.\r\n- To ja ho mám radšej hneď ráno.\r\n- Ale choď. Veď to je ešte rozospalá, spotená, z pusy jej cítiť...\r\n- To nevadí, ale mám aspoň istotu, že som prvý!', 281, 3.53, 43),
	(9647, 'Gynekológ prijíma novú sestričku do ordinácie a pýta sa jej, koľko mala sexuálnych priateľov.\r\nOna sa zamyslí a potom povie: \r\n- Asi tak 5 - 6.\r\n- To nie je nejako málo??? - pýta sa doktor.\r\n- Hm, tiež si myslím, bol to nudný víkend.', 249, 3.41, 43),
	(9648, 'Stretne manželka svojho muža 8. marca na ulici s kyticou kvetov. Celá usmiata sa ho spýta: \r\n- To je pre mňa?\r\n- Nie, je to pre sekretárku.\r\nOna zamračene na neho: \r\n- Tak sekretárke kvety a mne chuja?\r\n- Chceš vymeniť?', 229, 3.72, 43),
	(9649, 'Chlapec sa pýta svojho kamaráta:\r\n- Poraď, aký kvet mám dať jednej babe, ktorá sa mi páči?\r\nKámoš hovorí:\r\n- Ak ju chceš držať za ruku, daj tulipán. Ak ju chceš pobozkať, daj jej ružu. Ak ju chceš chytiť okolo pása, daj jek jasmín.\r\n- Dík. Tak jej dám kaktus.', 284, 4.07, 43),
	(9650, 'Rozprávajú sa dvaja dedkovia v krčme:\r\n- Ty, Peter, ešte sa môžeš milovať?\r\n- Nie, už nevládzem. A ty vari ešte áno?\r\n- No, tak po svinsky.\r\n- A to je ako?\r\n- Nuž, stará ma zaňho chytí a ja kvičím.', 215, 3.67, 43),
	(9651, 'Vnučka je na prázdninách u svojho nahluchlého dedka. Raz takto vbehne do domu a nadšene volá:\r\n- Dedo! Predstav si, na záhradke nám vyrástla takáto mrkva a katééto kaleráby!\r\nDedko odpovie:\r\n- A máš ho rada, dievčatko?', 234, 3.31, 43),
	(9652, 'Hovorí muž neznámej žene:\r\n- Slečna, tak sa na mňa pozeráte, akoby ste mali voľný byt.', 95, 3.17, 43),
	(9653, 'Prišiel Mišo v nedeľu nad ránom domov. Ožratý ako doga. Okamžite zaspal. Manželke Dore sa ho uľútostilo a tak ho povyzliekala. Našla mu pri tom vo vrecku použitý prezervatív. Tak ju to nasralo, že mu ten prezervatív zastrčila do zadku a ďalej to neriešila. No v nasledujúcich dňoch sa Mišo zmenil. Z roboty ide rovno domov, pomôže Dore umyť riad, vynesie smeti, potom spolu s ňou pozerá telku... Po týždni to už Dore nedalo a pýta sa:\r\n- Čože ty tak zrazu už s kamarátmi na pivo nechodíš?\r\n- Nie sú to už pre mňa od soboty žiadni kamaráti!', 581, 3.73, 43),
	(9654, 'Príde chlapík za prostitútkou a pýta sa:\r\n- Za koľko by si šla?\r\nOna mu vraví:\r\n- Za päťsto.\r\nChlapík sa chytí za hlavu:\r\n- Päťsto? To je veľa, ja mám len stovku.\r\nBaba prevráti oči a povie:\r\n- Stovka je málo!\r\nA chlapík: \r\n- Ale mám aj mobil.\r\nOna porozmýšľa a hovorí:\r\n- Tak dobre. Stovka a mobil.\r\nKeď je po všetkom, chlapík sa oblečie a dáva jej sto korún.\r\n- A čo ten mobil? - pýta sa prostitútka.\r\n- Aha. No píš si 0905...', 463, 3.9, 43),
	(9655, 'Francúz a rus pracujú v jednej firme. Francúz každé ráno vojde, sadne si, dá si prst pod nos, privonia a túžobne vzdychne: \'Susie.\' Tak sa to opakuje deň, dva a na tretí to už Rus nevydrží a spýta sa ho, čo to je. Francúz hovorí:\r\n- Vieš, ja ženu každé ráno obšťastňujem prstami a preto si ho voniam.\r\nNa druhý deň príde Francúz dnu, sadne si, privonia k prstu a hovorí:\r\n- Susie.\r\nRus na neho pozrie, priloží nos k ramenu, prevonia ho od hora až po prsty a hovorí:\r\n- Nataša.', 512, 3.63, 43),
	(9656, 'Dve spermie sa stretnú a jedna z nich je totálne dokaličená, ruka v sadre, obväz na hlave.\r\n- Čo sa ti preboha stalo?\r\n- Ja vlastne ani neviem... Spomínam si, že večer bolo najskôr veľké zemetrasenie, potom som šialenou rýchlostou narazila do kachličiek v kúpelni a potom tma...', 294, 3.82, 43),
	(9657, 'Buratino dospel a po prvých skúsenostiach so ženami sa prišiel posťažovať tatkovi Carlovi. \r\n- Pomoc, tatko! Ženy so mnou nechcú spávať, lebo im po milovaní zostávajú vnútri triesky!\r\nTatko Carlo ho upokojuje a dá mu šmirgel, aby si ho vyhladil. Po týždni:\r\n- Tak čo, Buratino, ako ženy?\r\n- Aké ženy? Ja už teraz ženy nepotrebujem - usmeje sa blažene Buratino.', 386, 3.46, 43),
	(9658, 'Sťažuje sa Jano Martinovi:\r\n- Ten sex už nie je, čo bývalo. Predtým som za noc spravil aj desať čísiel a teraz ma už po druhom bolí ruka.', 148, 3.27, 43),
	(9659, 'Ide Marienka s Jankom po lesnom chodníčku a Marienka zbadá, ako si to dvaja v kríčkoch rozdávajú. Spýta sa Janka, čo to vlastne robia.\r\n- No... On ju straší!\r\n- A postrašil by si ma aj ty? - spýta sa naliehavo Marienka.\r\nTak Janko ju straší prvý raz, druhý raz.... dvadsiatypiaty raz...\r\n- Janíčko, Janko postrašíš má ešte raz, prosím!\r\n- Bu bu bu, ty stará šľapka!', 393, 3.66, 43),
	(9660, 'Dedko s babkou ležia v posteli. Babka sa pýta:\r\n"Na čo si myslel takto pred 50 rokmi?"\r\n"Na to, ako ťa pomilujem tak, že prídeš o rozum, a prsia ti vysajem do sucha."\r\n"A teraz myslíš na čo?", pýta sa babka s nádejou v hlase. \r\n"Na to že sa mi to podarilo..."', 272, 3.71, 43),
	(9661, 'Príde mladík do lekárne a pýta si tri tucty prezervatívov.\r\n- Načo vám bude toľko kondómov? - pýta sa predavač\r\n- Idem dnes večer ku mojej priateľke, jej rodičia potom odchádzajú na víkend na chatu a tak to budeme robiť ako diví!\r\nPríde mladík na večeru, posadí sa za stôl, tam je celá rodina a mladík je po celý čas mĺkvy a tichý.\r\n- Čo ti je? Čo sa tváriš tak otrávene? Nepáčia sa ti moji rodičia, či čo? - pýta sa ho milá keď sú na chvíľku sami\r\n- Nič mi nevyčítaj! - vybuchne on - Prečo si mi sakra nepovedala, že tvoj otec je lekárnik?', 592, 4.09, 43),
	(9662, 'Rozdelenie dámskej konfekcie:\r\n- Šaty\r\n- Minišaty\r\n- Sukňa\r\n- minisukňa\r\n- mikrosukňa\r\n- Nanosukňa\r\n- Onanosukňa', 120, 3.41, 43),
	(9663, 'On a ona v posteli. Zrazu zazvoní telefón. On zdvihne, chvíľu počúva a potom sa obráti k žene vedľa a spýta sa:\r\n- Prepáčte, ale vy ste pani Poláková?', 164, 3.18, 43),
	(9664, 'Čo sa neodporúča hovoriť počas sexu:\r\n- Ten plafón by sme už mali vymaľovať.\r\n- Ako to, že obaja máme penis?\r\n- Hotovo? Už si dnu?\r\n- Pravdaže si jediná, ktorú som kedy miloval, len nechápem prečo sa na to všetky pýtate?', 239, 3.37, 43),
	(9665, 'Prečo majú muži na penise dierku?\r\nAby mali okysličený mozog!', 66, 3.29, 43),
	(9666, 'Príde muž za ženou a pýta sa:\r\n"Pani, vadí Vám vietor?"\r\n"Ani nie."\r\n"No tak ja vám ho tam teda fuknem."', 111, 3.23, 43),
	(9667, 'Manželský párik sa miluje a po chvíli hovorí ona jemu:\r\n"Počuvaj, dnes je to o ničom."\r\nO nej na to:\r\n"Ani ty si nevieš na nikoho spomenúť?"', 150, 3.5, 43),
	(9668, 'Viete, čo je totálne trenie?\r\nKeď v kláštore zostane zo sviečky iba knôt.', 80, 3.41, 43),
	(9669, 'Chlapík sedí celé poobedie v bare a leje do seba koňak za koňakom. Blíži sa záverečná a barman sa ho pýta, čo to oslavuje.\r\n"Zapíjam svoju prvú skúsenosť s orálnym sexom."\r\nEj, tak to sa musí naozaj osláviť. Tu máte, pozornosť podniku" - ponúkne ho barman.\r\n"Ďakujem, ale ani tento pohár nevymaže odporný pocit z mojich úst, nič to už nevymaže!"', 376, 3.54, 43),
	(9670, 'Sklamaná dievčina príde na breh mora s jasným úmyslom spáchať samovraždu. Nevie sa však odhodlať na svoj posledný skok a tak ju nájde okoloidúci námorník.\r\n"Pozri sa, si ešte mladá, bolo by hriechom skoncovať so životom. Ja zajtra odchádzam na dlhšiu plavbu do Austrálie. Môžeš ísť so mnou. Prepašujem ťa na palubu, budem ti nosiť jedlo, postarám sa o teba a ty zas o mňa. Budeme šťastní, neboj..."\r\nOna sa nakoniec nechá presvedčiť a ide na loď. Námorník jej každý večer nosí chlebíčky, džúsy a ovocie  a súložia každú noc. O päť týždňov však kapitán lode objaví "čierneho pasažiera."\r\n"A ty tu čo robíš?"\r\n"Mám takú dohodu s jedným vašim námorníkom. On ma vezie do Austrálie a ja za to s ním spávam..."\r\n"Želám ti veľa úspechu, ale mala by si vedieť, že toto je loď pobrežnej hliadky."', 870, 3.77, 43),
	(9671, '- Anča, ľahni si.\r\n- Čo som kurva? Zvaľ ma.', 47, 3.58, 43),
	(9672, 'Akú rozprávku majú rady nymfomanky?\r\nObušku z pytle ven!', 60, 3.26, 43),
	(9673, 'Aký je rozdiel medzi frajerom a superfrajerom?\r\nFrajer si nechá vyfajčiť a potom sa pýta: "No čo moja, aký som bol?"\r\nSuperfrajer si nechá fajčiť - nepostaví sa mu a povie:  "Počúvaj cicuška, stáva sa ti to častejšie?"', 235, 3.46, 43),
	(9674, 'Chceš pritlačiť telo na telo? \r\nCítiť dych? \r\nUvedomiť si vône? \r\nRôzne polohy? \r\nDnu-von? \r\nZpredu-zozadu? \r\nÁno?\r\nTak nástup do autobusu!', 149, 3.41, 43),
	(9675, 'Žena má v posteli milenca. Zrazu niekto zvoní. Žena príde k dverám a zistí, že prišiel manžel. Vbehne do spálne a hovorí milencovi aby rýchlo odišiel, že manžel je strašne žiarlivý, že by ho zabil. Muž holý vyskočí z okna. Akurát sa beží maratón a tak sa pridá. Po chvíľke sa ho pýta spolubežec:\r\n"Prečo nemáte číslo?"\r\n"Viete, je horúco, mohol by som sa zapariť a dostať nejaké vyrážky."\r\nPo 5 minútach sa ho opäť pýta:\r\n"Prečo nemáte ani trenírky?"\r\n"Viete je horuco a mohli by sa mi zapariť stehná."\r\nPo 5 minútach sa ho opäť pýta:\r\n"A prečo bežíte bez topánok?"\r\n"A viete ... je horúco a tie ekzémy."\r\nTak bežia ďalej a opäť sa ho spolubežec pýta:\r\n"A ten prezervatív, to máte načo?"\r\n"No viete, až tak horúco zase nie je."', 800, 3.92, 43),
	(9676, 'Čo sa stane, keď ženu opustí muž aj milenec?\r\nMá po vtákoch.', 67, 3.32, 43),
	(9677, 'Roztržitý profesor hovorí svojim študentom zážitok z dovolenky.\r\n- Mám zbraň, tri náboje a ide na mňa lev. Nabíjam prvý, strieľam, lev nič. Nabíjam druhý, strieľam, lev stále na mňa. Nabíjam tretí, znova netriafam, beriem nohy na plecia a ... \r\nV tom v jeho kabinete zazvoní telefón. Keď vybaví telefón, vráti sa a pýta sa študentov: \r\n- Kde som skončil?\r\n- Beriete nohy na plecia a ...\r\n- A ako ju lížem, tak ju lížem...', 455, 3.64, 43),
	(9678, 'Prichytená prostitútka na výpovedi u policajtov:\r\n- Ale veď ja neponúkam sexuálne služby. Ja len predávam kondómy a navyše grátis ponúkam ich bezplatné testovanie.', 176, 3.99, 43),
	(9679, 'Premrznutý horolezec vojde do chaty a vidí na lavičke nádhernú turistku. Horolezec: \r\n- Slečna, viete, mám omrznuté ruky. V príručke sa píše, že omrzliny treba ošetriť tak, že omrznuté časti dáme medzi stehná v hornej časti a trieme ich.\r\nSlečna súhlasí. Po chvíli horolezec vďačne odtiahne ruky, turistka zneistie a pýta sa:\r\n- Uši vám náhodou neomrzli?', 385, 3.4, 43),
	(9680, 'Ako dosiahneš, aby žena kričala ešte hodinu po orgazme?\r\nUtrieš si penis do záclony.', 90, 3.75, 43),
	(9681, 'Muž sa pýta ženy v posteli:\r\n- Tak čo, aké to je?\r\n- Pripomína mi to plavbu po oceáne!\r\n- Takže som divoký a romantický?\r\n- Nie! Je mi z teba zle!', 156, 3.91, 43),
	(9682, 'Prechádza sa starý pán lesom a zbadá ku stromu priviazanú nahú mladú ženu.\r\n- Čože sa vám stalo?\r\n- Vlákali ma do lesa, priviazali ku stromu a znásilnili.\r\n- A nevolali ste o pomoc?\r\n- Volala som, ale nikto sa neozval.\r\n- To je dobre, dcérenka, to je dobre, tak si šuchnem tiež.', 294, 3.26, 43),
	(9683, 'Hovorí Marka roztúžene Janovi: \r\n- Janíčko, a či má ani nepobozkáš?\r\n- Ale Marka, veď ja som ti len sused. Ja by som sa s tebou ani milovať nemusel.', 159, 3.26, 43),
	(9684, 'Príde osemročný chlapec do erotického baru a zakričí na servirku:\r\n- Hej zlato, čo takto škótsku s ľadom?\r\n- Ale chlapče, chceš aby som mala kvôli tebe problémy?\r\n- Možno neskôr, cica, ale najskôr by som si dal ten drink.', 238, 3.74, 43),
	(9685, 'Viete, čo hovorí nervózna žena pri sexe?\r\nTak si už rozmysli či dnu alebo von.', 84, 3.39, 43),
	(9686, 'Jedna spermia hovorí druhej:\r\n- Už sa teším, keď sa dostaneme do maternice!\r\n- Len sa neteš, sme iba pri mandliach.', 121, 3.65, 43),
	(9687, '- Drahý, dnes ťa pomilujem na spôsob Gabčíkovo-Nagymaros. \r\n- A to je ako?\r\n- Rozrobím ťa a nedokončím.', 112, 3.46, 43),
	(9688, 'Príde mladý muž do drogérie a pýta si čierny prezervatív. Predavačka sa udivene pýta: \r\n- A to prečo práve čierny?\r\nMladík zúfalo odpovedá: \r\n- Ale, zomrela mi svokra a žena drží smútok!\r\nPredavačka po dlhom hľadaní odpovedá:\r\n- Viete čo mladý pán, čierny nemáme, ale vezmite si tento a dajte si ho na pol žrde!', 340, 3.2, 43),
	(9689, 'Muž sedí vo vlaku v kupé a oproti nemu sedí žena s veľkým výstrihom a ešte väčšími darmi v ňom. On sa zahľadí do výstrihu a ona mu na to hovorí:\r\n"Keď neprestanete, dám vám jednu do zubov!" \r\nA muž na to:\r\n"Áno, áno a tú druhú do ruky."', 262, 3.73, 43),
	(9690, '- Dedko, čo je to sex?\r\n- Jááj synak, to je niečo, čo fungovalo ešte za starej republiky.', 95, 3.26, 43),
	(9692, 'Otázka: Prečo sa hovorí, že sex je ako droga? \r\nOdpoveď: Keď to na teba príde, musíš si pichnúť.', 107, 3.72, 43),
	(9693, '- Dľa cego paninka nevzdychá?\r\n- To pan jus go tam má?\r\n- Tak!\r\n- V tym prypadku - ach.', 90, 2.92, 43),
	(9694, 'Viete prečo je morská panna stále panna?\r\nLebo Golfský prúd je stále teplý!', 82, 3.38, 43),
	(9695, 'Otázka: Dá sa hovoriť s manželkou po milovaní?\r\nOdpoveď: Jasné, máme predsa mobilné telefóny. ', 104, 3.37, 43),
	(9696, 'Chlap v aute zastaví jednej krásnej, dobre vyvinutej kočke. Ona nastúpi. Po chvíľke sa muž ozve hľadiac na jej hrudník:\r\n- Pekný sveter.\r\n- Pravý, z ťavej kože.\r\n- To som si mohol domyslieť podľa tých veľkých hrbov.', 233, 3.7, 43),
	(9697, 'Na sexuologickom seminári sa prednášajúci pýta študentov, koľko spôsobov milovania poznajú.\r\n- Päťdesiatpäť, päťdesiatpäť! - ozve sa zo zadnej lavice.\r\n- No moment, pekne poporiadku. Tak koľko poznáte napríklad vy?- opýta sa študenta v druhej lavici.\r\n- Štyri.\r\n- A vy?\r\n- Sedem.\r\n- No, to je pekné. A koľko poznáte vy? - opýta sa študenta v prvej lavici.\r\n- Jeden.\r\n- Iba jeden? No tak nám ho prezradte.\r\n- No, žena leží na chrbte, má rozkročené nohy a muž leží na nej.\r\nZozadu sa ozve:\r\n- Päťdesiatšesť, päťdesiatšesť!', 566, 3.83, 43),
	(9698, 'Z listu:\r\n- Jednou rukou držím Vašu fotku a druhou na Vás myslím...', 72, 4.02, 43),
	(9699, 'Hovorí Janko Aničke:\r\n- Anička, príď dnes večer ku mne, nikto mi nebude doma!\r\nAnička prišla večer k Jankovi a fakt nikto nebol doma.', 142, 3.37, 43),
	(9700, 'V USA vymysleli novú antikoncepciu pre mužov. Požíva sa po pohlavnom styku a mení ich krvnú skupinu.', 106, 3.08, 43),
	(9701, 'Zastaví auto na krajnici pri prostitútke:\r\n- No čo, koľko stojíš?\r\n- Asi tak pol hodinu.', 94, 2.93, 43),
	(9702, 'Zvoní zvonček, otvorí mladá žena a tam stojí chlap a pýta sa:\r\n- Je starý doma?\r\n- Nie je.\r\nChlap vojde dnu a mladú ženu znásilní. Na druhý deň znova. A takto to ide celý týždeň. Po týždni jej to nedá a hovorí si:\r\n- Čo ten chlap môže chcieť od môjho muža?', 284, 3.64, 43),
	(9703, 'Aká je definícia manželky?\r\nKvôli jednej klobáse chová celý život jednu sviňu.', 87, 3.53, 43),
	(9704, 'Príde dedko s babkou ku lekárovi a dedko hovorí:\r\n- Viete, pán doktor, mi sme si chceli s babkou trocha užiť ale nejako nám to nejde.\r\nDoktor im predpísal lieky. Babke zlaté a dedkovi strieborné. Prídu domov a dedko hovorí:\r\n- Babka ja chcem mať tie zlaté!\r\nA tak si ich vymenili. Po týždni prídu opäť ku lekárovi a lekár sa ich spýta:\r\n- No čo, ako to dopadlo?\r\nA dedko nato:\r\n- No viete pán doktor, bolo to také divné. Babke stŕpla noha a mne sa otvorila rana z druhej svetovej.   ', 510, 3.35, 43),
	(9705, 'Pýta sa zákazník prostitútky:\r\n- Panna?\r\n- Nie, silonky.', 60, 3.07, 43),
	(9706, 'Čo je najkrajšie na nahom chlapovi?\r\nNahá žena.', 51, 3.61, 43),
	(9707, 'Babka s dedkom sa dohodnú, že si troška ešte užijú.\r\nBabka navarí večeru, dedko nachystá stôl a zapáli sviečky.\r\nBabka naservíruje večeru a jedia. Dedko celý nedočkavý schmatne babku a prehne ju cez stol, dvihne sukňu a začne ju milovať.\r\nBabka po chvílke hovorí:\r\n"Dedko ti to robíš jak za mlada."\r\n"Bodaj by nie, keď mi vosk kvapká na zadok"', 369, 3.7, 43),
	(9708, 'Príde muž nečakane domov a vidí, ako jeho ženu obrábajú traja chlapi. Zarazene stojí vo dverách a zmôže sa iba na prekvapivo - nahnevaný výkrik:\r\n- Hej, hej, hej!\r\nNa to jeho žena:\r\n- A čo, mňa nepozdravíš?', 224, 3.51, 43),
	(9709, 'Čo robí zoofil v samoobsluhe?\r\nObchytkáva mrazené kurčatá.', 64, 3.45, 43),
	(9710, 'Vieš, čo by sa stalo, keby sa každý muž oženil so svojou najlepšou sexuálnou partnerkou?\r\nVymrelo by ľudstvo, lebo každý by sa oženil so svojou pravou rukou. ', 170, 3.34, 43),
	(9711, 'Na divokom západe sa miluje rýchly Joe s Mary. V tom niekto zaklope. Rýchly Joe sa oblečie, utečie oknom. Mary ide ku dverám a pýta sa:\r\n"Kto je?"\r\nSpoza dverí sa ozve: \r\n"To som ja, rýchly Joe, zabudol som si nohavice..."', 231, 3.99, 43),
	(9713, 'Stretne muž ženu:\r\n- Vy ale máte pekné nohy!\r\n- A ktorá sa vám páči viac? Pravá alebo ľavá?\r\n- Hmm, niečo medzi tým.', 129, 4.08, 43),
	(9714, 'Sex is like:\r\nNIKE - Just do it\r\nPhilips - Let´s make things better\r\nNOKIA - Connecting people\r\nSAMSUNG - Everyone is invited\r\nPEPSI - Ask for more', 148, 4.01, 43),
	(9715, 'Dve kolegyne v práci: \r\n"Čo ste robili včera večer so šéfom v jeho kanceláríi?"\r\n"Ále iba mi ukazoval čo nedokáže PC."', 130, 3.16, 43),
	(9716, 'Aký je rozdiel medzi nosom a penisom?\r\nNos to vie v rozhodujúcej chvíli potiahnuť dovnútra!', 96, 3.55, 43),
	(9717, 'Aký je rozdiel medzi ženou a sliepkou?\r\nSliepka sedí pokojnejšie na vajciach.', 81, 3.25, 43),
	(9718, 'Hovorí muž žene po milovaní:\r\n- Keby som nevedel, že máš astmu, tak by som si myslel, že si má vypískala.', 115, 3.17, 43),
	(9719, 'Riaditeľka dievčenskej školy zoznamovala nové študentky so školou a považovala za nutné zmieniť sa i o sexuálnej morálke. \r\n- Vo chvíľach pokušenia položte si len jedinú otázku - Stojí jedna hodina potešenia za hanbu na celý život?\r\nNa konci výkladu chcela vedieť, či sú nejaké otázky. Jedna dievčina hanblivo zdvihla ruku:\r\n- Mohla by ste nám prosím povedať, ako sa to robí, aby to trvalo hodinu?', 429, 3.4, 43),
	(9720, 'Muž so ženou: \r\nOn: \r\n- Miláčik, keď mi to nebudeš robiť pusinkou, tak ti vypadajú zúbky!\r\n- Ako to?\r\n- Pretože ti rozbijem hubu!', 139, 3.46, 43),
	(9721, 'Rozprávajú sa dvaja kamaráti pri pive:\r\n- Počúvaj. Moja žena mi nikdy nedá za pravdu!\r\nDruhý na to:\r\n- Možno za peniaze by ti dala.', 140, 3.4, 43),
	(9722, 'Existuje: horúci sex, štipľavý sex, rýchly sex, chránený sex, telefónny sex...\r\nNo pre ľudí s tvojim výzorom žiadny sex - nanajvýš svojpomocný sex!', 162, 2.95, 43),
	(9723, 'Príde chlap do krčmy, celý doškriabaný. Ostatní sa ho pýtajú, že čo sa stalo.\r\n- Ále spadol som z bicykla.\r\n- A to si sa tak doškriabal aj na nohách?\r\n- Veď hovorím, že som spadol z bicykla.\r\n- Aj na chrbáte?\r\n- Normálne som spadol!\r\n- Aj na hlave?\r\n- No a čo. Veď je to moja mačka a môžem s ňou robiť čo chcem!', 337, 3.09, 43),
	(9724, 'Ako sa sťahujú dámske nohavičky?\r\nPo kolená rukou a potom ako keď sa štartuje motorka.', 93, 3.61, 43),
	(9725, 'Otecko sa sprchuje v kúpeľni, keď tu zrazu do kúpeľne vtrhne jeho 4 ročná dcérka a pýta sa ho:\r\n- Ocko, to čo máš medzi nohami ?\r\nPrekvapený a zaskočený ocko narýchlo odpovedá:\r\n- Vieš, to je taky ježko.\r\nDcérka na to: \r\n- Oci, ten ježko má ale riadne veľký penis, čo?', 293, 3.81, 43),
	(9726, 'Podíde muž k prekrásnej žene:\r\n- Pomilovali by ste sa so mnou za milión korún?\r\n- Hm, myslím, že áno.\r\n- A za stovku?\r\n- No dovoľte, čo si vy myslíte, že som nejaká štetka?\r\n- Na tom, čo ste, sme sa už zhodli. Teraz sa už len dohadujeme na cene.', 263, 3.43, 43),
	(9727, 'Príde muž do ordinácie a sťažuje sa lekárovi, že vždy, keď vidí krásnu ženu, tak sa mu postaví a je mu to nepríjemné, lebo to vidno. Lekár mu poradil, aby si ho priviazal o nohu. Chlapík to urobil, celý natešený vybehol na ulicu ale vrazil do perfektnej baby v kratučkej minisukni. Nohy mu okamžite vyleteli do vzduchu a na zemi ho začalo hádzať. Slečna pristúpila k nemu, že ako mu môže pomôcť. Muž sa na ňu otočí a prosebným tónom, plným bolesti, jej hovorí:\r\n- Prosím vás, prosím vás odídte, lebo mi nohy doláme.', 561, 3.64, 43),
	(9728, 'Potkaj se dvě blechy.\r\nJedné je hrozná zima a druhá jí říká:\r\n"Proč si nevlezeš holce mezi nohy tam je krasný teplíčko."\r\nPotkaj se druhej den a ta první je zase zmrzlá, druhá se jí ptá proč neposlechla a ona odpovídá:\r\n"Já tě poslechla. Bylo tam takový teplíčko že jsem usnula. No a potom se probudim ve vousech myslivce kterej jel na motorce."', 372, 3.44, 43),
	(9729, 'Stretne chlapík peknú slečnu a hovorí jej:\r\n"Slečna, nechcela by ste sa so mnou pomilovať?"\r\n"No dovolte, čo som ja nejaka prostitútka?"\r\n"Ale no to nie, veď kto tu hovorí o platení?"', 194, 3.1, 43),
	(9730, 'Pozerá Alojz na slečnu s nadmerne vyvinutým hrudníkom. Po chvíli to už slečna nestrpí a ozve sa:\r\n"Keď sa na mňa neprestanete pozerať, tak vám dám jednu do zubov!"  \r\n"Áno, áno, a druhú do ruky!"', 211, 3.07, 43),
	(9731, 'Príde muž k doktorovi a hovorí:\r\n"Moja žena nemá rada francúzske milovanie, čo mám robiť?"\r\nDoktor:\r\n"Keď prídete domov natrite si ho nutelou a zajtra mi prídete povedať či to zabralo."\r\nNa druhý deň muž celý naradostený hovorí doktorovi:\r\n"Bolo to fantastické,nič lepšie som do teraz nezažil."\r\nDoktor:\r\n"A čo žena jej sa to páčilo?"\r\nMuž:\r\n"Neviem, deti ju predbehli."', 399, 3.28, 43),
	(9732, 'Sťažujú sa tri ľahké dievčatá. Prvá:\r\n- Je to bieda, včera som musela dať za večeru.\r\nDruhá:\r\n- A ja za lístok na autobus, aby som sa dostala domov.\r\nTretia:\r\n- A ja zadarmo, už tri dni som nemala nič teplého v ústach.', 235, 3.28, 43),
	(9733, 'Mladá pohľadná dáma sedí u gynekológa. Keď sa už dostala na radu, vošla do dverí a keď ju gynekológ zbadal, prudko zatvoril dvere, mrskol ju na kozu, strhol z nej šaty a okamžite pomiloval. Hneď potom hovorí: \r\n- Mladá pani, tak toto bol môj problém, a aký je ten váš? \r\n- Chcela som sa iba spýtať, či je možné, aby človek mal naraz kvapavku, syfilis a AIDS, lebo to tvrdí môj kožný lekár!', 422, 3.76, 43),
	(9734, 'Čo je vrchol drzosti?\r\nKeď žena orálne uspokojí muža a on sa na konci opýta "Aký  som bol?".', 100, 3.59, 43),
	(9735, 'Muž sa v autobuse nakloní k neznámej dáme a pošepká jej do uška:\r\n- Dobre lížem a som diskrétny.\r\nOna mu na to hovorí: \r\n- Tak si vylíž zadok a nikomu o tom nehovor.', 178, 3.75, 43),
	(9736, 'Aký zvuk vydáva chlp padajúci zo ženského prirodzenia?\r\n"Tfuj, tfuj, tfuj..."', 82, 3.04, 43),
	(9737, 'V lete na pláži ležia dve šľapky. Ide okolo vymakaný maník dobre vybavený. Jedna vraví:\r\n- To by bol ale perfiš sex.\r\nDruhá:\r\n- Že ťa huba nebolí. Veď sme povedali, že do večera na robotu ani nepomyslíme.', 222, 3.82, 43),
	(9738, 'Manželský pár leží v posteli. Muž sa pritúli k žene a začne ju hladkať, ale žena mu povie:\r\n- Dnes nie. Zajtra idem ku gynekológovi a chcem byť čistá.\r\nMuž na to:\r\n- A ideš zajtra aj k zubárovi?', 212, 3.53, 43),
	(9739, 'Viete, aký je rozdiel medzi tvrdým sexom a tvrdou drogou?\r\nPo tvrdom sexe nevidno vpichy!', 91, 3.77, 43),
	(9740, '- Anička, a bojíš sa ty búrky?\r\n- Nie Janíčko, a prečo sa pýtaš?\r\n- Lebo mám vtáka ako hrom!', 103, 3.31, 43),
	(9741, 'Muž príde z práce domov a povie žene, že sa chce s ňou milovať. Žena mu ale povie, že nomôže, lebo má menštruáciu. No muža to neodradí a povie, že mu to nevadí. Ráno po skvelom sexe sa prebudí, ženy nikde len celá posteľ je krvavá. Myslí si, že ju zabil. Keď príde do kúpeľne a pozrie sa do zrkadla povie si: \r\n- Ježiši, ja som ju nielen zabil ale som ju aj zjedol!', 397, 3.12, 43),
	(9742, 'Čo je absolútna sexmánia?\r\nKeď sa žena pri kupe banánu opýta, kde je skúšobná kabína.', 96, 3.08, 43),
	(9743, 'Super sms: \r\nProstredníctvom Vášho mobilného telefónu sme odpočúvali Vašu poslednú súlož. Vy a váš partner ste boli vybratí na dabovanie filmu Jurský Park III.', 174, 3.71, 43),
	(9744, 'Dedko si povzdychol:\r\n"Ten sex už nie je čo býval. Dakedy som zvládol za noc 4 ,6 aj 10 čísel. Teraz ma už po treťom začne bolieť ruka."', 146, 3.33, 43),
	(9745, 'V sprche: \r\n- Ty si robíš dobre?\r\n- Nie, to si ho iba tak rýchlo umývam.', 76, 3.93, 43),
	(9746, 'Chlapci zo susednej dediny prišli k dedovi Petrášovi: \r\n- Dedo, čím to je, že vám už ťahá na 90-tku a všetky dievčatá z okolia chodia len za vami?\r\n- Neviem, chlapci, neviem. - hovorí dedo a oblizne si pritom šedivé obočie.', 240, 3.31, 43),
	(9747, '- Pán doktor, potreboval by som rozrezať úd, a hneď aj zašiť.\r\n- Ste normálny?\r\n- No asi hej, pred týždňom ste mi to isté spravili s prstom a už ho neohnem!', 168, 3.4, 43),
	(9748, 'Na pustom ostrove stroskotajú žena a dvaja muži. Po mesiaci žena hovorí:\r\n- Už mám dosť toho brutálneho sexu, idem sa odstreliť.\r\nOdstrelí sa. Po ďalšom mesiaci jeden muž hovorí:\r\n- Už mám dosť toho brutálneho sexu, zakopeme ju.\r\nPo ďalšom mesiaci druhý muž hovorí:\r\n- Už mám dosť toho brutálneho sexu, vykopeme ju.', 343, 3.63, 43),
	(9749, 'Stretnú sa dve kamarátky.\r\n- Predstav si. Tá Mara sa ale má. Má muža, mileca a ešte ju aj znásilnili.', 109, 3.29, 43),
	(9750, 'Nastúpi krásna slečna do taxíka a pýta sa:\r\n"Môžem fajčiť?"\r\n"Čoby nie,keď sa vám zmestí hlava pod volant!"', 120, 3.44, 43),
	(9751, 'Miluje sa malomocný  s babou.Keď skončia hovorí mu:\r\n"Vieš ja mám AIDS."\r\n"Jak dobre,že som ho tam nechal."', 114, 3.88, 43),
	(9752, 'Mladá prostitútka si privedie do izby zákazníka. Pri vyzliekaní sa jej muž medzi rečou spýta:\r\n"A koľko máš vlastne rokov?"\r\n"Trinásť."\r\n"Trinásť? Tak to ja radšej idem inde." vykríkne rozhorčene muž a odíde.Dievča sa zamračí a zafrfle:\r\n"Tak si len choď, hlupák jeden poverčivý!"', 307, 3.9, 43),
	(9753, 'Príde chlapík k doktorovi.\r\n"Prosím Vás naočkujte mi kvapavku!"\r\n"Prečo? Každý sa jej chce len zbaviť a vy si ju chcete dať naočkovať?"\r\n"No to je tak. Odo mňa ju dostane moja žena, od ženy ju dostane sused, od suseda to dostane jeho žena a od jeho ženy to dostane mäsiar. A ten mäsiar je taká strašná sviňa, že mu to doprajem."', 352, 4.06, 43),
	(9754, 'Bývajú dvaja chalani na školskom internáte a hovorí jeden druhému:\r\n- Vieš, budem tu mať večer ženskú návštevu. Tu máš päťdesiatku a choď niekde do kina alebo na pivo a vráť sa čo najneskôr. \r\nKamarát teda strávil večer mimo intrák a okolo polnoci sa vracia späť. Príde do izby a len čo otvorí dvere, vidí plno peria z paplónov, posteľ zlámaná, okolo triesky z poličiek, záclona roztrhaná a on leží v strede toho neporiadku.\r\n- Tak koľko?\r\n- Sedemkrát!\r\n- A ona?\r\n- Ona neprišla!', 523, 3.48, 43),
	(9755, 'Homosexuál sa dostane po smrti k svätému Petrovy, ktorý má rozhodnúť či pôjde do neba alebo do pekla.Ako sa tak prechádzajú rajskou záhradou sv.Peter sa zohne pre jablko. Homosexuál neodolá a rozdá si to s ním.\r\n"Ak sa to ešte raz zopakuje pôjdes okamžite do pekla."\r\nPrechádzajú sa ďalej a Petrovi spadne pero .Homosexuál neodola a zopakuje sa predošla scéna.\r\n"Tak toto je už vrchol, ideš do pekla."\r\nO pár dní  príde sv.Peter do pekla a tam strašná zima.Ide za Luciferom a pýta sa ,č to má znamenať.\r\n"No.  To máš tak.  Skús sa zohnúť pre polienko."', 593, 3.63, 43),
	(9756, 'Zazvoní chlapík večer pri dverách v paneláku. Otvorí mu pohľadná žena. \r\n- Dobrý večer mladá pani, mohol by som sa s vami pomilovať? \r\n- To snáď nemyslíte vážne, taká drzosť! Ešte ste od nikoho nedostali po papuli? \r\n- Ale áno, už som dostal päť krát po hube, ale tri razy som si vrzol.', 312, 3.39, 43),
	(9757, '"Daj Anča, spravím ti to do ucha!"\r\n"No určite, ešte by som ohluchla."\r\n"Ale prosím ťa a čo si včera onemela?!"', 119, 3.52, 43),
	(9758, 'Co je to? Je to pod Skálou a má to roztažený nohy?\r\nPaní Skálová.', 72, 3.16, 43),
