	(9760, 'Aký je rozdiel medzi plateným a neplateným sexom?\r\nTen neplatený je oveľa drahší!', 88, 2.91, 43),
	(9761, 'Traja trpaslíci - Hundroš, Čuško a najmenší Kýblik sa dohodli so snehulienkou, že sa s ňou vyspia. Prvý ide hundroš a na druhý deň sa ho ostatný dvaja pýtajú:\r\n- Tak ako?\r\n- No, ja päť a snehulienka šesť.\r\nPochvália ho a na ďalší deň ide Čuško a zas sa ho ostatný dvaja pýtajú:\r\n- Tak ako? \r\n- No, ja osem, snehulienka sedem.\r\nZnova ho pochvália a ako posledný ide kýblik. Na ďalší deň sa ho znova ostatný dvaja pýtajú:\r\n- Tak ako?\r\n- No. ja päťdesiatosem.\r\n- A snehulienka?\r\n- Tá neprišla.', 534, 3.16, 43),
	(9762, 'V ankete sa pýtajú 10.000 náhodne vybratých amerických žien - respondentiek:\r\n\'Vyspali by ste sa s prezidentom Clintonom?\'\r\n90% z nich odpovedalo:\r\n\'Nikdy viac.\'', 167, 3.47, 43),
	(9763, 'Viete čo robí muž, keď zje iba osminu Viagry?\r\nPodpichuje.', 62, 3.28, 43),
	(9764, 'Pravé vajce hovorí ľavému:\r\n"Ide pekná baba."\r\n"Ako to vieš?"\r\n"Šéf sa postavil."', 89, 3.48, 43),
	(9765, 'Rozprávajú sa dvaja priatelia:\r\n"Predstav si, včera som zachránil svoju kolegyňu pred znásilnením."\r\n"Nehovor, a ako?"\r\n"Ukecal som ju."', 143, 4.07, 43),
	(9766, 'Zastaví bavorák pri skupine štyroch prostitútok, stiahne sa okno, vystrčí sa z neho ruka a ukazuje na prostitútky: \r\n- Ty, ty a ty. \r\n- A čo ja? - ozve sa štvrtá. \r\n-Áno, aj ty. Všetky ste kurvy!', 207, 3.73, 43),
	(9767, 'V čakárni u lekára vybehne sestrička do miestnosti, kde čaká veľa ľudí a zakričí:\r\n" Pán Trtkal?"\r\nNik sa neozýva. Po Hodine vybehne opäť a zvolá:\r\n" Pán Trtkal?"\r\nA opät sa nik neozýva.Poobede vybehne opať sestrička do čakárne a vidí tam sedieť jedného pána. Podíde k nemu a opýta sa ho:\r\n" Pán Trtkal?"\r\n"Nie, pán kakal."', 354, 3.14, 43),
	(9768, 'Do lekárne vstúpi ustaraný chlapík a hovorí pani magistre: \r\n- Prosím vás, čo by ste mi mohla ponúknuť na... viete... no.. totiž.. ja trpím sústavnou erekciou.\r\nMagistra: \r\n- Tak to vám môžem dať byť, stravu a päť tisíc mesačne.', 250, 3.19, 43),
	(9769, 'Muž so ženou sa milujú. Žena po chvíli začne:\r\n- Rýchlo, rýchlo už je skoro tu.\r\nMuž prestane a opýta sa:\r\n- Kto?\r\n- Orgazmus.\r\nMuž celý rozhorčený:\r\n- No tak to je dobré, ja som skoro vo vyvrcholení a tu tu čakáš na nejakého Gréka!', 254, 3.33, 43),
	(9770, 'Príde dedko do bordelu,vidí ho bordelmama a hovorí:\r\n"Dedko,ale vy už to máte dávno za sebou."\r\n"Áno a čo som dlžný?"', 127, 3.41, 43),
	(9771, 'Stýco Marcin, žena Anča a dcéra Beta prišli prvý krát k doktorovi.Doktorovi sa však dcéra zdá primoc mladá na takých starých rodičov a tak sa strýca pýta:\r\n"Koľko je Bete?" \r\nStrýco vyvalí oči, ale povie:\r\n"Dvakrát týdne."\r\n"Ale strýcu, ja sa nepýtam na sex, ale jak je Beta strará?" \r\nStrýco vyvalí oči i jazyk, ale povie:\r\n"Lepšie, jak ta stará!"', 378, 3.39, 43),
	(9772, '- Skúšal si už sex po telefóne? \r\n- Nie, sú tam malé dierky. ', 67, 3.38, 43),
	(9773, 'Príde zákazník do obchodu zo zbraňami a skúša si pušku. Je dobrá, ale nedala by sa vyskúšať ?\r\n"Nie, nie v žiadnom prípade, lebo minulý týždeň, jeden zákaznik, tu skúšal pušku prestrelil strop a našej sekretárke rovno medzi nohy."\r\n"Stalo sa jej niečo?"\r\n"Jej nič, ale šéfovi to odtrhlo jazyk."', 321, 3.31, 43),
	(9774, 'Ide opitý muž z krčmi a dostane chuť si dobre vyhoniť.Ide okolo kravína,vojde dnu-aby sa mohol ukryť, a nasadí si dojací prístroj na vtáka.Keď už mal dosť,načiahol ruku po vypínač.Namiesto vypínača však našiel ceduľu s nápisom: \r\nVypína sa automaticky po piatich litroch.', 295, 4.21, 43),
	(9775, '- Počúvaj! Za zneužitie maloletej je basa osem až päťnásť rokov!\r\n- A čo má byť, ujo?\r\n- To ja len, aby si vedela, čo teraz riskujem.', 145, 3.11, 43),
	(9776, 'Mladá hovorí chalanovi :\r\n"Na to že máš 30 rokov máš ho nejakého malého."\r\n"Na to že máš 12 rokov si nejaká papuľnatá!"', 134, 3.28, 43),
	(9777, 'Mudruje Adam v raji:\r\n- Je to nespravodlivé, že nám Boh dal len 15 rokov sexu  a pritom opiciam ho dal na 25 a papagájom dokonca na 60 rokov. Tak to teda nie! Idem za nimi, aby mi dali polovicu zo svojho.\r\nA tak aj urobil. Odvtedy chlap 15 rokov môže, 12 rokov robí opičky a zvyšok života o tom len rozpráva.', 319, 3.3, 43),
	(9778, 'Čo to je vernosť?\r\nNedostatok iných príležitostí.', 55, 2.99, 43),
	(9779, 'V preplnenom autobuse vodič prudko zabrzdi a mladá dievčina pristane v lone sediaceho mladého farára.\r\n- O-h-h! - veľmi prekvapene vykríkne dievča so záujmom pozerajúc na svätého muža.\r\n- To nieje o-h-h, dcéra moja, to je kľúč od kostola.', 255, 3.03, 43),
	(9780, 'Slovenský maďar ide na Trabante, stopne ho pri Komárne stopárka, tiež ´maďarka´.\r\nPo chvíli sa dievčina pýta:\r\n"Móžem pofajčiť?"\r\n"Móžeš,keď mestí hlava pod kórmáň."', 188, 2.87, 43),
	(9781, 'Pán farár sa ide vymočiť k latkovému plotu svojej záhrady. Ako si uľavuje, z druhej strany plota sa k jeho prirodzeniu blíži koza.\r\n"Koza !Koooza.Koozička ."', 167, 3.1, 43),
	(9782, 'Rozprávajú sa dvaja chlapi:\r\n- Už si spal s mojou ženou?\r\n- Nie.\r\n- Ale mal by si. Je lepšia ako tvoja.', 108, 3.3, 43),
	(9783, 'Príde chlapík do bordelu, že si chce trochu užiť a vypiť, ale má pri sebe len 150 korún. Bordelmama mu hovorí :\r\n"Dobre, na 2. poschodí je jedna škaredá, tá ti dá."\r\nChlapík zaklope, vo dverách sa objaví žena:\r\n"Dobrý deň, ja by som si chcel zapichať a niečo si vypiť."\r\n"Lenže ja nemám klitoris."\r\n"To nevadí, môže byť aj Gambrimus."', 363, 3.37, 43),
	(9784, 'Príde záhorák domov a vidí ako sa jeho manželka súloží so susedom a kričí:\r\n"Já sem to vedel,já sem to vedel!"\r\n"Ty si to vedel a on to ešte stále vie!"', 166, 3.59, 43),
	(9785, 'Príde chlap do bordelu a pýta si tú najčiernejšiu černošku, akú majú. Keď ju dostane, zaplatí za ňu ťažké prachy, ide s ňou do izby a hovorí jej:\r\n"Tak a teraz sa vyzleč!A teraz sa otoč ku mne chrbtom a hlboko sa predkloň!Ešte viac!Taaaaak!A teraz sa mozeš obliecť!"\r\n"A to je všetko?"\r\n"Hej."\r\n"A to už prečo?! Nepáčim sa ti ?"\r\n"Ale hej. Len ja doma robím kúpelňu a chcel som iba vidieť, ako budú vyzerať čierne kachličky s ružový špárovaním."', 486, 3.73, 43),
	(9786, 'Chlapík dáva ženám hádanku.\r\n"No dámy, že to neuhádnete.Takže je to pre vás, dáva sa to do vás a keď sa to z vás vytiahne tak z toho kvapká."\r\nŽenské sa začnu rehliť o dušu, ale tu im chlapík vysvetľuje. Takže dámy sú to kvetiny - sú pre vás, dávaju sa do váz, a keď sa z vázy vytiahnu tak z nich kvapká.Na to príde manželka jednžho pána a ten jej hneď hovorí:\r\n"Počúvaj,aby si o to neprišla : je to pre teba, dáva sa to do teba, a keď sa to z teba vytiahne tak to kvapká."\r\nNa čo v sále ostanú všetci ticho a jedna kolegiňa pretne cez zuby:\r\n"To som teda zvedavá ako z toho vtáka urobíš karafiát?"', 652, 3.37, 43),
	(9787, 'Pýta sa riaditeľ sekretárky:\r\n- Viete čo je to Ludolfovo číslo?\r\n- Viem! Len si nemôžem spomenúť ako sa pri tom držia nohy.', 134, 3.12, 43),
	(9788, '- Čo plačeš? Vari je ti Miško neverný?\r\n- Keby len Miško...', 65, 2.54, 43),
	(9789, 'Rozhovor milencov:\r\n- Zlatko, ty si úžasný milenec. Sme spolu len dva týždne a ja som už v treťom mesiaci.', 113, 3.25, 43),
	(9790, 'Riaditeľ hovorí sekretárke:\r\nMám strašnú chuť na sex.\r\nSekretárka dobehne a pýta sa: \r\n- Mám sa vyzliecť, alebo stačí iba vyhrnúť sukňu?\r\n- Stačí, keď vypľujete žuvačku.', 191, 3.41, 43),
	(9791, 'Ako spravíte z trojuholníka čiarku?\r\nHoliacim strojčekom.', 61, 3.38, 43),
	(9792, 'Fero vo vlaku na chodbe osloví mladú dievčinu:\r\n- Slečna, mohol by som vám trošku zahryznúť do bradavky?\r\n- Človeče, čo si to dovoľujete?\r\n- Slečna, ale každé také jemnučké zahryznutie je hodné 1000 korún.\r\nDievčina zneistie. Tisícka je slušný peniaz za takú maličkosť, tak súhlasí. Idú na WC, dievča si tam rozopne blúzku a  Fero ju začne hladkať po prsiach. Jednoducho sa s nimi trochu hrá. Dievčina je netrpezlivá: \r\n- No tak si už zahryznite. Nevidíte, ako mi je trápne?\r\n- Aj by som si zahryzkal, - odvetí Fero - ale nemám na to peniaze.\n\n', 586, 4.23, 43),
	(9793, 'Pýta sa Fero Anči:\r\n- Hej Anča, nedáš?\r\n- Čo si to dovoľuješ?!\r\n- A za stovku?\r\n- To je málo...  ', 106, 3.48, 43),
	(9794, 'Dedko hovorí vnučke:\r\n- Daj si mrkvu.\r\n- A kam?', 49, 3.19, 43),
	(9795, 'Dora s Marou sú také balzakovské typy. Vymieňajú si skúsenosti. Mara sa pýta:\r\n- Ako si na tom so sexom?\r\n- Výborne. - odvetí Dora.\r\n- Ja mám problém, Fero často nie je doma.\r\n- To nie je žiadny problém. Keď dostaneš chuť, zavolaj do vodárni a povedz, že ti voda tečie. Das si krátku sukničku, príde inštalatér, ty sa hlboko zohneš, aby si mu ukázala kde pod umývadlom tá voda tečie... a on zozadu...\r\nDora prišla domov a hneď začala hľadať číslo k vodárom, nemohla ho nájsť, chuť mala veľkú a tak zavolala k plynárom, že jej uniká plyn. Po chvíli prišiel inštalatér a pýta sa:\r\n- Tak kde vám to uniká.\r\nDora v krátkej sukničke sa hlboko zohla pri sporáku a ukazuje. V ten moment inštalatér zozadu... A Dora kričí:\r\n- Oj...oj... nie do tej dierky!!\r\n- Jaj, milá pani, v tom prípade ste mali volať vodárov, my sme plynári!', 886, 3.22, 43),
	(9796, 'Šéf prijíma sekretárku a hovorí jej:\r\n- Na skúškach ste obstála dobre, hodnotenie a doporučenie vynikajúce, ale rád by som vedel, či viete dobre počítať.\r\n- Samozrejme perfektne.\r\n- Tak chodte do vedľajšej miestnosti, zoblečte sa a počítajte s tým, že za chvíľu som u vás.', 297, 3.03, 43),
	(9797, 'Zhovárajú sa dvaja chlapi.\r\n- Tak ma napadlo... ty, ja a tvoja žena do trojky. Čo ty na to?\r\n- Tak nato zabudni. So mnou nepočítaj.', 137, 2.81, 43),
	(9798, 'Po rokoch stretne Fero Jana a vidí, že on viditeľne schudol, a kedže aj on by chcel tak schudnúť, tak sa ho pýta, ako to dokázal. On mu dá adresu jednej firmy a on tam na druhý deň zájde. Tam ho zavrú do miestnosti a po chvíli vojde žena, vyzlečie sa a hovorí:\r\n- Ak má chytíš, tak má môžeš pretiahnuť.\r\nNaháňa ju tri hodiny, ale nechytí ju. Príde domov, postaví sa na váhu a fakt schudol 5 kíl. Na druhý deň vojde do tej istej miestnosti, poukladá všetky veci tak, aby ju mohol chytiť a čaká. Zrazu sa otvoria dvere, vojde svalnatý černoch a hovorí :\r\n- Ak ťa chytím, tak ťa pretiahnem.', 632, 3.54, 43),
	(9799, 'Príde Anka do sexshopu:\r\n"Pppprosssssím vvvás nnnnnnnemmmáte vvvvvvibrrátorrrr ttttypppu T-36?"\r\n"Samozrejme,chcete si ho kúpiť?"\r\n"Nnnnnie llllllen mmmmy pppovvvedzte aaaako ssssa vvvypína."', 199, 3.71, 43),
	(9800, 'Atraktívna dievčina stopuje keď pri nej zastaví auto s mladým vodičom. Prebehne klasická konverzácia a dievča sa zrazu zarazí:\r\n"Ježišmária,nie ste vy náhodou ten moderátor z rádia?"\r\n"No som a čo má byť?" \r\n"Viete moji rodičia dnes oslavujú výročie svatby a ja by som im chcela dať niečo zahrať. Nešlo by to?"\r\n"Bohužial, je mi to naozaj ľúto, ale dnes máme veľmi veľa ľudí, ktorí si chcú nechať  niečo zahrať."\r\nDievča je ale neoblomné:\r\n"Urobím pre vás všetko čo budete chcieť."\r\nMladík samozrejme súhlasí a na prvej zátačke odboči do lesa, rozopne si nohavice a vyzíva dievčinu k činnosti.\r\n"Viete ja som to ešte nikdy nerobila, som trochu nervózna?"\r\n"To je v poriadku to určite zvládnete." \r\n"Myslíte?"\r\n"Určite!"\r\nDievčina sa teda zohne k jeho prirodzeniu, vezme ho do ruky a roztrasenym hlasom hovorí:\r\n"Milá mamička a otecko."', 901, 3.4, 43),
	(9801, 'Viete ako rozdelí Snehulienka jablko medzi siedmych trpaslíkov?\r\nZje ho a dá každému.', 90, 3.73, 43),
	(9802, 'Žena ide do kopca a padne jej kabelka.Ide za nou muž,vidí jej kundu a začne ju prášiť.Žena prekvapene hovorí:\r\n"Čo robíte?"\r\n"Sústružníka v toske."', 161, 3.25, 43),
	(9803, 'Piráti vysadia jedného z nich na opustenom ostrove. Na prilepšenie mu dajú ovcu a odídu.O päť rokov sa vrátia a vidia na ostrove pobehovať malého chlapca. Spýtajú sa ho: \r\n- Ako sa voláš?\r\n- Michal Beeeeedran.', 223, 2.88, 43),
	(9804, 'Otázka na rádio Jerevan:\r\nMôže jedna žena otehotnieť od druhej?\r\nMôže, ak si tá druha neumýva zuby.', 109, 3.21, 43),
	(9805, 'Náhodná známosť z nočného podniku. Skončilo to, ako sa niekedy stáva, v posteli. Blíži sa vyvrcholenie, tempo sa stupňuje, keď zrazu on prestane a zahľadí sa skúmavo na partnerku. \r\n- Čo sa stalo, čo si prestal?\r\n- Počúvaj, dúfam, že nemáš AIDS!\r\n- Nie, prečo sa pýtaš?\r\n- Lebo raz som sa už popálil.', 328, 3.56, 43),
	(9806, '- Splním ti každú sexuálnu fantáziu! \r\n- Ty máš naozaj osla aj dogu? ', 76, 2.99, 43),
	(9807, 'Přijde paní učitelka do třídy a ptá se dětí, jestlipak vědí, kdo včera umřel. Přihlásí se Pepíček a povídá:\r\n"Tomáš Marný."\r\n"Jak to víš, Pepíčku? Toho pána neznám."\r\n"Když jsem šel včera kolem ložnice našich, tak tatínek zrovna povídal mamince: Tomáš marný, ten už nevstane."', 315, 3.18, 43),
	(9808, 'Přijde žena ke gynekologovi a říká mu, že onemocněla nemocí Vagina pectoris. Doktor se zamračí:\r\n"To těžko, paní, já znám jen anginu pectoris."\r\nŽena trvá stále na svém, tak jí doktor přikáže, ať se vysvleče a lehne si na lůžko. Jak si lehne, doktor sundá kalhoty lehne na ní a začne s ní souložit. Žena vzdychá a říká:\r\n"Co to děláte, pane doktore?"\r\n"Ordinuju vám Penicilin."', 417, 2.91, 43),
	(9809, 'To takhle přišla do zubní ordinace pěkná ženská, posadila se do křesla, vyhrnula sukni, sundala kalhotky a roznožila. Lékař ji jemně upozornil, že je u zubaře a ne u gynekologa. Načež odvětila:\r\n"Dělal jste Františku Novákovi včera zuby? Jo? Tak si je laskavě vyndejte."', 292, 3.38, 43),
	(9810, 'Anča doma otvorí chladničku a niečo tam hľadá. Vidí to jej muž Fero, zdvihne Anči sukňu a šup jej ho tam. Anča na to:\r\n- Fero, ty si už taký sprostý, ako tí chlapi v robote.', 189, 3.56, 43),
	(9811, 'Kričí pani z okna:\r\n- Pane, podte ku mne!\r\n- To by ste musela byť sama...\r\n- Muž je na služobnej ceste!\r\n- Nechajte ma dohovoriť! Sama na celom svete!', 156, 3.18, 43),
	(9812, 'Sedia dvaja zamilovaní na lavičke v parku a on jej hovorí:\r\n"Anička vidiš ten veľký voz?"\r\n"Nie Jurko, ale cítim ojo."', 126, 3.11, 43),
	(9813, 'Po souloži se ptá prostitutka zákazníka:\r\n" Hele, nemáš náhodou AIDS ?!"\r\nA zákazník odpoví, že nemá, načež si prostitutka oddychne:\r\n" Už jsem se bála ,že ho chytím podruhé !!!"', 197, 3.19, 43),
	(9814, 'A tuhle znáte ?\r\n"Občane," ťuká strážce zákona na rameno podivně sebou cukajícímu muži,"co to tady, na veřejném prostranství, děláte?" \r\n"Co bych dělal? Souložím!" \r\n"No - v zásadě to zakázáno není. Ale kde máte partnerku?" \r\n"Byla hotová dřív, tak šla domů."', 289, 3.16, 43),
	(9815, 'Sedí tři u piva a hádaj se, čí manželka má větší orgasmus.\r\n"Když se do toho pustím a stará to začne prožívat, tak u toho řve, že vzbudí sousedy na patře." \r\n"To nic není. To já když se do toho dám, tak křičí tak, že vzbudí nejen sousedy  na patře, ale i partaje nad náma a pod náma."\r\n"Na moji starou nemá žádná.Ta když má při milování orgasmus, tak ji slyším až tady v hospodě."', 425, 3.32, 43),
	(9816, 'Stretnú sa dvaja pedofili a jeden vraví:\r\n"Počúvaj, mám novú frajerku. Má štyri roky, ale vyzerá na dva !"', 115, 3.14, 43),
	(9817, 'Dnes som pretiahol svoju šéfku... \r\nBolo by od veci zažiadať o zvýšenie platu??? ', 87, 3.24, 43),
	(9818, 'Príde blázon do bordelu a zaťuká na okienko.\r\n- Dobrý den, co si přejete?\r\n- Prosím vás honíte tady čúráky?\r\n- To víte že jo!\r\n- Tak si mě chyťte mladá paní!', 175, 3.38, 43),
	(9819, 'Hovorí dinosuarus dinosauríci:\r\n- Veď nebuď taká! Veď vyhynieme!!!\r\nA bola taká! A vyhynuli!', 99, 2.96, 43),
	(9820, 'Na slovensko-polských hraniciach prepadnú turistu. Zbijú ho, okradnú, vyzlečú do naha a priviažu o strom. Keď tam tak narieka, pýta sa ho jeden miestny.\r\n- Co še panovi stalo? \r\nTento mu plačom odpovedal ako pochodil. Že ho zbili, okradli a poviazali. Miestny sa zamyslí, pomaly rozopne poklopec a vraví: \r\n- Tak še mi vidzi, že pan dneška nema ščesce.', 371, 3.38, 43),
	(9821, 'Vo vlaku sedí muž a pozerá krásnej dievčine do výstryhu.Ona si to všimne a opýta sa:\r\n"Čo sa tak zvrhlo pozeráte?"\r\n"Keď vy máte také pekné kozy."\r\n"A nechcete tak jednu do huby?!"\r\n"Ale áno, a druhú by som hladkal."', 232, 3.31, 43),
	(9822, 'Syn sa múdro opýta svojho otca:\r\n"Ocko, vysvetli mi co je to paradox?"\r\n"Choď za mamou a opýtaj sa, či by dala za 100 mariek."\r\n"Ocko, dala by, to je ten paradox?"\r\n"Nie, nie je to paradox. Opýtaj sa sestry, či by dala za 100 mariek."\r\n"Ocko, dala by , to je ten paradox?"\r\n"Nie synček. Vieš čo je vlastne paradox?  že prostitútok máme plný dom a valutu ani jednu."', 379, 3.13, 43),
	(9823, '- Marienka, myslíte na to, na čo ja?\r\n- Áno pán riaditeľ, ale nie s vami.', 78, 2.84, 43),
	(9824, 'Rozpráva Fero Mišovi:\r\n- Človeče, keď som bol v Rusku, cestoval som vlakom do Vladivostoku. Bola so mnou v kupé perfektná ženská. Tá postava, tie boky, to poprsie! A keď sa vyzliekla, to ešte len bola nádhera. Tak sme si to rozdali, ale ona sa potom rozplakala, že má strašne dobrého muža, ktorého strašne miluje a ktorému strašne ublížila, keď ho podviedla. Líčila to tak dojímavo, že aj mne ho prišlo ľúto a tiež som sa rozplakal...\r\n- No a čo bolo potom? - vyzvedá Mišo.\r\n- Čo by malo byť? Takto sme celé tri dni a tri noci sexovali a plakali, sexovali a plakali...', 607, 3.28, 43),
	(9825, 'Mladá spermia mala problémy s významom svojho života, a tak sa šla poradiť so starou spermiou. Tá jej vraví:\r\n- Dobre počúvaj. Keď nadíde tvoj čas, otvoria sa vráta, budeš dlho letieť, až kým vletíš do veľkej miestnosti, kde bude veľká červená guľa. Slušne sa predstavíš, že si spermia a tá guľa ti povie, že ona je zasa vajíčko. Ďalej už pôjde všetko úplne samo. \r\nKeď nadišiel ten správny čas, vráta sa otvorili a spermia letela obrovskou rýchlosťou vpred. Vletela do veľkej miestnosti... Lenže tam bola nie jedna, ale dve veľké červené gule. Trocha prekvapená mladá spermia sa uklonila a rozpačito povedala:\r\n- Dobrý deň, ja som spermia!\r\n- Dobrý deň! - odvetili tie veľké gule - My sme mandle!', 759, 3.54, 43),
	(9826, 'Ide tehotná mníška po ulici a na plné ústa ziape.\r\nČo zase dali do tých sviečok.', 88, 3.54, 43),
	(9828, 'Príde zákazník ku prostitútke a hovorí jej:\r\n- Zívnite ako najviac viete.\r\nProstitútka roztiahne ústa ako najviac vie. Nato jej zákazník hovorí:\r\n- No tak to by nešlo.', 179, 3.13, 43),
	(9829, 'Vlak vyšiel z tmavého tunela a chlapík v kupé sa prihovorí slečne:\r\n- Slečna, ten bol ale dlhý.\r\nSlečna blažene odvetí:\r\n- To bol váš?', 147, 3.21, 43),
	(9830, '- Pán doktor, mám problémy s... hmm... no veď viete z čím.\r\n- A rozprávali ste sa o tom s vašim sexuálnym partnerom?\r\n- S rukou sa nemienim rozprávať!', 161, 3.26, 43),
	(9831, 'Žena sa háda s mužom. Na konci hádky odíde do spálne a začne si baliť svoje veci do kufra.\r\n- Kam chceš ísť? - pýta sa muž.\r\n- K Petrovi. Môžem u neho bývať a ešte mi dá 500 korún za každú súlož. \r\nV tom si aj manžel začne baliť veci.\r\n- A kam ideš ty? - pýta sa prekvapená žena.\r\n- K Petrovi. Chcem vidieť, ako vyžiješ z 1 000 korún ročne!', 376, 3.51, 43),
	(9832, 'Karol má zdravotne problémy a musí kožnej lekárke ukázať svoj penis. Tá vyvalene hľadí  na Karolkove štyri centimetre. \r\nKarol: - Vy hľadíte tak nenásytne... Čo ste ešte nevidela erekciu?', 203, 3.29, 43),
	(9833, 'Na jednej poolparty sa stretne beloch s černochom. Po niekoľkých drinkoch beloch vstane, stiahne si nohavice, ponorí penis do vody a ledabolo prehodí: \r\n- Voda má presne 22,04 stupňov.\r\nČernoch to po ňom zopakuje a aj on ponorí svoj penis do vody a prehlási:\r\n- A je presne 1,92 metra hlboká.', 304, 3.47, 43),
	(9834, 'Dve blondínky po firemnej oslave: \r\n- A čo, dala si sa aj pretiahnuť?\r\n- Áno, dva krát.\r\n- Čo, len dva krát?\r\n- Raz od kapely a raz od požiarneho zboru.', 160, 3.25, 43),
	(9835, 'Pedofil zazvoní u suseda a hovorí:\r\n"Môžem si u vás skočiť na malú?"', 76, 3.59, 43),
	(9836, 'Mravenec se slonem prožijí krásnou noc plnou vášní.Mravenec se vzbudí a vedle něho leží mrtvý slon.A řekne si:\r\n"No to je super, jednou zažije sex a já abych potom celej život kopal hrob."', 203, 3.39, 43),
	(9837, 'Milionár príde do Amsterdamu, vychutnať si nočný život. Vôjde do bordelu, a vraví že chce ale to najlepšie čo majú. Vôjde krásavica, zavedie ho ku oknu a vraví mu:\r\n"Vidíš ten mercedes? To audi? Ten rols? Tak to je všetko moje, pretože to po francúzsky viem najlepšie."\r\nVšetko je v pohode chlapík spokojný odíde. Na druhý deň príde za ňou a vraví jej že by skúsil anál. Ona ho znova zavedie ku oknu a ukazuje mu:\r\n" Vidíš ten dom, tú reštauráciu, ten hotel? To všetko mám lebo som super na anál."\r\nVšetko o.k. chlap spokojný po tom odíde, a na tretí večer za ňou príde, že by teda chcel do škatuľky. Ona ho zavedie ku oknu a vraví: "Vidíš tú jachtu, ten parník, ten tanker? Tak to všetko by mohlo byť moje, keby som bol žena."', 786, 3.15, 43),
	(9838, 'Kamarát sa pýta kamaráta:\r\n- Aký máš vzťah ku skupinovému sexu?\r\n- Kladný, ako každý moderný človek.\r\n- Dobre, tak si ťa zapíšem.\r\n- A kto sa zúčastní?\r\n- Ja, ty a tvoja žena.\r\n- Hm. Tak s tým ja ale nesúhlasím.\r\n- Fajn, tak teba si škrtám.', 265, 3.4, 43),
	(9839, 'Manžel sa vracia zo služobky a keď ho žena zbadá, ako prichádza, hovorí milencovi, ktorého má vedľa seba: \r\n- Rýchlo vyskoč z okna, lebo keď ťa tu nájde, tak ťa zabije.\r\nChlapík si pomyslí, že je jedno ako zomrie a skočí. Vo vzduchu ako tak padá, prosí Boha:\r\n- Bože, už budem svojej žene verný, odpusť, už za inými nepôjdem.\r\nV tom sa ozve hrubý hlas:\r\n- Ej veru nepôjdeš...', 409, 3.16, 43),
	(9840, 'Otec so synom sa prechádzajú po obchode a chlapec zbadá stojan s kondómami. Ukáže na trojité balenie a pýta sa otca:\r\n- Tati, na čo sú tieto?\r\n- Tie sú pre stredoškolákov. Jeden na piatok, jeden na sobotu a jeden na nedeľu.\r\nChlapec potom ukáže na balenie so šiestimi kondómami:\r\n- A na čo sú tieto?\r\n- Tie sú pre vysokoškolákov. Dva na piatok, dva na sobotu a dva na nedeľu.\r\n- A pre koho sú tieto? - pýta sa chlapec a ukazuje na balenie s dvanástimi kusmi.\r\n- Tie sú pre ženatých mužov. - povzdychne si otec - Jeden na január, jeden na február...', 581, 3.78, 43),
	(9841, 'Ide cudzinka v Prahe po Václavskom námestí a vidí, ako z podchodu vychádza muž a zapína si gombíky na rázporku nohavíc. Obráti sa na neho, ukáže rukou a pýta sa:\r\n- Metro?\r\nMuž sa kyslo zatvári, mávne rukou a odpovie: \r\n- Kdežeby metro, nanajvýš tak nejaké to centimetro.', 292, 2.78, 43),
	(9842, 'Príde žena do obchodu a pýta sa:\r\n- Prosím vás, máte extra veľké kondómy?\r\n- Samozrejme. Chcete?\r\n- Nie, ale... vadilo by vám, keby som tu počkala, kým niekto bude chcieť?', 184, 3.01, 43),
	(9843, 'Jeden manželský pár má doma v spálni papagája, a ten vždy všetko každej návšteve vykecá. A tak ho začali zakrývať. Raz príde manžel domov a hovorí žene:\r\n- Okamžite sa vyzleč, ľahni si na posteľ a roztiahni nohy. Ja sa rozbehnem z chodby, urobím dvojitý premet so saltom a pristanem rovno na tebe.\r\nA vtom sa ozve z klietky:\r\n- Vyrežte mi jazyk, ale toto musím vidieť !', 397, 3.68, 43),
	(9844, 'Príde reportérka na salaš k bačovi Ondrovi.\r\n- Bača, je to pravda, že keď sa vám postaví, trinásť vrán si naň sadne?\r\n- Ále, ľudia toho nakecajú. Tá trinásta stojí iba na jednej nohe.', 202, 3.25, 43),
	(9845, 'Kedy zažije kňaz najväčšie vzrušenie?\r\nKeď pretiahne omšu.', 66, 3.17, 43),
	(9846, 'Potká mladík na ulici mladou slečnu a říka:\r\n"Slečno nebojíte se bouřky.\r\n"Proč?"\r\n"Já ho mám totiž jako hrom."', 123, 2.96, 43),
	(9847, '- Marienka, poď do postieľky, poď.\r\n- Nejdem Janko, nejdem.\r\n- Marienka poď poď.\r\n- Tak dobre.\r\nMarienka išla do postieľky.\r\n- Marienka, poď pod perinku, poď.\r\n- Nejdem Janko, nejdem.\r\n- Marienka, poď, poď.\r\n- Tak dobre.\r\n- Pozri ako mi svietia hodinky!', 264, 3.35, 43),
	(9848, 'Budí žena Duriho v noci, aby sa šiel milovať. Duri vyskočí, zažne nočnú lampu, pozrie na hodiny a hovorí:\r\n- Čo si sa zbláznila? Kde ti ja teraz o pol tretej ráno niekoho zoženiem!', 194, 3.29, 43),
	(9849, 'Prečo v NDR neboli sexshopy?\r\nLebo jazda v trabante bola lepšia ako vibrátor.', 80, 3.66, 43),
	(9850, 'Strážnik príde k zaparkovanému autu a pýta sa:\r\n- A vy čo tu robíte?\r\nZ auta:\r\n-  Mi sa bozkávame.\r\nStrážnik:\r\n- Tak rýchlo dajte ústa do gatí a vypadnite.', 168, 3.05, 43),
	(9851, 'Mladá slečna zavolá na erotické služby.Po hodine niekto zaklope na dvere.Dievčina otvorí a pred dverami stojí lilipután.Dievčina sa ho opýta čo si praje a on na to že je z erotických služieb a že prišiel aby vykonal svoju prácu.Na to dievča hovorí:\r\n"Ale ja som si žiadala svalnatého, tmavého, vysokého chlapa."\r\n"Čo nie je môže byť a luskol prstami."\r\nV tom momente sa premenil na svalnatého, vysokého krásavca. Pri milovaníi dievčina premýšľa ako sa mohol z takého malého liliputána stať taký krásavec. Na to sa ho hneď opýta:\r\n"Počúvaj to mi nejde do hlavy."\r\nAni nedopovedala a muž luskol prstami a povedal :\r\n"Čo nie je môže byť."\r\nAkonáhle odpovedal roztrhlo jej hlavu.', 727, 3.55, 43),
	(9852, '-Ach, drahý! Daj si dole ten prsteň, škriabeš ma tam...\r\n- Ach, drahá! To nie je prsteň, to sú náramkové hodinky!', 122, 2.98, 43),
	(9853, 'Stojí takto chlapík na wc,ciká a pozerá na černocha vedľa:\r\n"Ehm, to vy černosi máte takých dlhých od narodenia?"\r\n"Nie, to si musíš vypestovať.\r\n"A akože to robíte?"\r\n"No to vieš, keď súložíš, musíš zasunúť rýchlo dnu a pomaly von."\r\nTak chlapík príde domov, rozdáva si to so ženou, a spomenie si na toho černocha. Tak aj on rýchlo dnu a pomaly von. Na to manželka ho strhne:\r\n"Fuj ty zvrhlík nechutný, robíš to ako černoch."', 464, 3.47, 43),
	(9854, 'Ako láka škótsky pedofil dieťa?\r\n- Dievčatko, nechceš si kúpiť cukrík?', 79, 2.94, 43),
	(9855, 'Pri Niagarských vodopádoch sa novinárka pýta Američana, Rusa a Slováka, na čo myslia, keď vidia tú padajúcu vodu, to prírodné divadlo, tú expresívnu scenériu. Američan:\r\n"Myslím na štart prvého amerického raketoplánu."\r\nRus:\r\n"Myslím na výstrel z Aurory."\r\nSlovák:\r\n"Myslím na sex."\r\nNovinárka:\r\n"Na sex? A prečo?"\r\nSlovák:\r\n"Ja naň myslím neustále."', 381, 3.05, 43),
	(9856, 'Učiteľka sa pýta študentiek: - Viete, aká je najlepšia antikoncepcia?\r\nŠtudentky: - Nie!\r\nUčiteľka: - Správne!', 120, 2.96, 43),
	(9857, 'Zamilovaný pár sedí na lavičke. Nad nimi je krásna letná nočná obloha.\r\n- Drahá, vidíš ten Veľký voz?\r\n- Nie, ale oje už cítim.', 142, 3.15, 43),
