	(9859, 'Šofér zastaví stopárke a pýta sa jej, kam ide.\r\n- Do Trnavy.\r\nPo desiatich kilometroch jej vraví:\r\n- Dnes ste už tretia, čo ide do Trnavy a je tehotná.\r\n- Ale ja niesom tehotná !\r\n- Veď ešte nie sme v Trnave.', 220, 2.77, 43),
	(9860, 'Je možné oplodniť ženu v behu?\r\nNie je! Je totiž vedecky dokázané že muž zo stiahnutými nohavicami vyvynie dvakrát menšiu rýchlosť ako žena zo zdvihnutou sukňou.', 177, 3.13, 43),
	(9861, 'Sťažuje sa jedna sekretárka druhej, že ich šéf, keď príde, tak má vždy dvojzmyselné narážky. Rozhodnú sa, že keď zasa začne, tak na protest odídu z kancelárie. Vtom vojde šéf a hovorí: \r\n- Baby, viete o tom, že do prístavu priplávala loď plná nadržaných námorníkov?\r\nTie dve sa zdvihnú a odchádzajú. Šéf kričí za nimi: \r\n- Kam utekáte? Loď tu bude kotviť celý týždeň.', 412, 3.18, 43),
	(9862, 'Pani Homolová ťahá domov zo striptízu svojho manžela a hovorí mu:\r\n"Starý, lahôdky si videl, večerať sa bude doma."', 125, 3.02, 43),
	(9863, 'Traja bačovia doja ovce. Ako ich tak doja, ťahajú za vemenáa, prvý z nich hovorí:\r\n- Boha chlapi, keby to tak bola Kim Basingerová!\r\nDruhý hovorí:\r\n- Keby to tak bola Pamela Andersonová!\r\nTretí na to:\r\n- Boha chlapi, keby už bola tma!', 246, 3.13, 43),
	(9864, 'Sedia dve kamarátky v kaviarni a jedna sa pýta:\r\n- Tiež musíš manželovi hovoriť, keď dosiahneš orgazmus?\r\n- Ja nemôžem, ja mu nesmiem volať do práce.', 162, 3.18, 43),
	(9865, 'Príde chlapík do lekárne:\r\n"Prosím si 20 tabletiek Viagry."\r\nLekárnik mu ich dá, chlapík ich naraz prehltne. Lekárnik mu vraví:\r\n"Preboha, však Vám to môze ublížiť." \r\nChlapík na to:\r\n"Nebojte sa, dnes večer mám žúr, príde ku mne 6 riadnych divošiek,\r\ntakže musím byť O.K."\r\nNa druhý deň príde ten istý chlapík do lekárne:\r\n"Prosím si 8 náplastí na krvavé mozole na rukách."\r\n"A čo sa Vám stalo?"\r\n"Ale, neprišli."', 453, 3.89, 43),
	(9866, 'Chlapec hovorí kamarátovi:\r\n- Na medveďa treba opatrne.\r\n- To ti povedal otec?\r\n- Nie, zoofil.', 97, 3.57, 43),
	(9867, 'Víš jak poznáš, že ho máš dobře vykouřenýho?\r\nŽe máš prostěradlo vcuclý do prdele...', 99, 3.03, 43),
	(9868, 'Doma:\r\n- Drahý, dnes v telke zase nič nedávajú. Budeš musieť opäť súložiť.', 85, 2.9, 43),
	(9869, 'Aký je rozdiel medzi spermiami a tatárskou omáčkou?\r\nTatárska omáčka nevletí do úst rýchlosťou 60 km/hod.', 116, 3.42, 43),
	(9870, 'Manželka si domov privedie milenca a hovorí mu, aby bol ticho, lebo ich papagáj všetko vykecia. Milenec hodí na klietku sako a hovorí:\r\n- Vieš čo, ty urobíš stojku pri stene a roztiahneš nohy. Ja sa rozbehnem, urobím dvojité salto a zapichnem sa do teba.\r\nZ klietky sa ozve:\r\n- Dajte dolu to sako, vytrhnite mi jazyk, ale toto musím vidieť!', 355, 3.3, 43),
	(9871, 'Pinoccio pozerá porno a plače:\r\n- A mne taký dlhý dali medzi oči.', 70, 3.26, 43),
	(9872, 'Víte, co je nejhorší pro muže při sexu zezadu?\r\nBýt vpředu.', 66, 3.23, 43),
	(9873, 'Žena si dá inzerát že hľadá muža s veľkým penisom. Príde prvý má ho metrového a ona mu na to že je to málo. Druhý ho má omotaného okolo tela a pri krku ho zviera veľký žaluď a ona mu na to že je to málo. Pri dverách niekto zazvoní, žena otvorí a je tam obrovský penis a na ňom ceduľka:\r\n"Som na stanici, prídem o chvíľu."', 355, 3.19, 43),
	(9874, 'Zo zápisníka stopárky:\r\nLepšie mať 15 centimetrov v tele ako 50 kilometrov v nohách.', 90, 3.08, 43),
	(9875, 'Príde žena k doktorovi a ten sa pýta: \r\n- Kde vás pichá? \r\n- V aute, ale sľúbil, že postaví barák.', 108, 3.17, 43),
	(9876, '"Anča, poď skratkou cez les."\r\n"Nemám čas, ponáhľam sa."', 62, 3.08, 43),
	(9877, 'Tak sa rozprávajú manžel s manželkou v posteli. A tak manželka vraví:\r\n- Ja to naozaj chcem.\r\n- Počúvaj, hovoril som ti, nechce sa mi to vyťahovať.\r\n- Ja ti to môžem vytiahnuť.\r\n- A ešte to rozbiješ.\r\n- Budem nežná.\r\n- Koľko krát ti mám povedať, ja ti tu kameru nedám! ', 291, 2.87, 43),
	(9878, 'Na moste stáli traja. On, ona a jemu. Ona mu hovorí:\r\n"Jožo, ožo, žo, ó."\r\nOn sa diví. Ona vysvetľuje:\r\n"Včera som bola v parku a Anča tiež hovorila svojmu frajerovi:\r\n"Jano, ano, nó, óóóó."\r\n"... a ako sa mu to páčilo!"', 238, 2.95, 43),
	(9879, 'Povídají si takhle holky ve třídě.\r\n"Tak si představte, že sem včera viděla pánské přirození. \r\n"Jo, tak nám řekni jak to vypadá ?"\r\n"Holky nic moc, je to vobičejnej čurák, ale menší."', 205, 2.42, 43),
	(9880, 'Mlady milenecký párik sa náružlivo miluje:\r\n"Ach, drahý , strašne by som chcela aby si sa mi vykakal na prsia"\r\nMladý síce chvíľu otáľa , ale nakoniec privolí a vykoná si potrebu na jej hrudník.Ona celá vo vytržení si to rozotiera po prsiach,po\r\nbruchu, jačí od vzrušenia, a po chvíli opäť vraví:\r\n"Miláčik, ale keby si ešte fakt trošku mohol tuto na bruško ja, sa asi zbláznim od vzrušenia, prosím drahý, veľmi Ťa ľúbim."\r\nMladý dlho váha , už nevie čo si o tom má myslieť , ale nakoniec \r\nprivolí, a z posledných síl ešte čo to vytlačí.\r\nReakcia sa objaví okamžite , ona si to opäť začne rozotierať po celom tele,po nohách, do rozkroku , úplne šalie.Po chvíli, ale opäť začne prosíkať:\r\n"Miláčik , ešte, ešte raz , z celého srdca Ťa prosím,trošku na tvár, premôž sa a urob mi ešte dobre, miláčik , prosím."\r\nMladý už úplne apaticky  by jej to aj spravil, len už jednoducho nemá co,je proste prázdny.\r\n"Drahá ja uz naozaj nemôžem , odpusť mi,ale fakt sa nedá."\r\n"Ty ma už vôbec nemáš rád!"', 1087, 2.68, 43),
	(9881, 'V nemocnici je vizita.Lekári chodia po izbách a primár im vysvetľuje diagnózy a ako ich liečia.Prídu do jednej izby a tam pacient onanuje.\r\nLekári sa pýtajú:\r\n"Tomuto pacientovy je čo?"\r\n"Má akútny nedostatok sexu a tak musí každé štyri hodiny onanovať."\r\nPrídu do ďalšej izby a tam sestrička prevádza na pacientovi orálny sex.\r\n"A tomuto je čo?"\r\n"Ten má tú istú diagnózu ako ten predtým,len má lepšiu poisťovňu."', 448, 3.69, 43),
	(9882, 'Mladomanželia bývajúci u rodičov, idú večer spať a zvedavá mamička ich špehuje cez kľúčovú dierku. Na druhý deň pri spoločných raňajkách sa opýta svojho syna:\r\n- Nehanbíš sa synček odzadu pomilovať svoju ženu, fuj, ako zvieratá. -- Vieš aké je to dobré, môžem ho tam dať hlbšie o niekoľko centimetrov. \r\nNa to sa mama obráti na otca a vytkne mu: \r\n- Vidíš starý, o koľko kilometrov si ma pripravil?', 438, 2.82, 43),
	(9883, 'V USA sa zhovárajú dvaja robotníci: \r\n- Naša krajina je najdemokratickejšia na svete. \r\n- Demokracia? Každý o tom hovorí, ale nikto nevie, čo to je. \r\n- Ja ti to vysvetlím na príklade, - hovorí prvý. - Predstav si, že neskoro večer sa vraciaš domov z práce. Ušiel ti posledný autobus, musíš ísť pešo, navyše sa spustí veľký lejak. Po ceste zrazu prichádza autom tvoj šéf. Zastaví, pozve ťa dnu a zavezie k sebe domov. Tam ti dá suché veci na prezlečenie, ponúkne ti za pohárik svojho najlepšieho koňaku. Kedže dážď neprestáva, navrhne ti, že môžeš u neho prespať. \r\n- Chceš povedať, že to všetko sa stalo tebe? \r\n- Mne nie, ale mojej sestre.', 695, 2.93, 43),
	(9884, 'Muž príde do gynekologickej ordinácie a pýta si od gynekológa nejaké tabletky pre svoju ženu,ktorá už nemá takú chuť ako on a teda mu nestačí. Gynekológ ako chlap ho chápe a preto mu zo svojej tajnej skrinky vyberie lieky a podá ich manželovi so slovami:\r\n"Tieto tabletky sú veľmi silné manželke dajte maximálne jednu." Manžel pri prvej príležitosti manželke dá do kávy nie jednu,ale pre istotu hneď dve tabletky. A jednu dá aj sebe. Manželka kávu vypije a po chvílke sa jej zalesknú oči a vzdychne si:\r\n"Potrebujem chlapa".\r\nNato sa aj manželovi zalesknú oči a vraví:\r\n"Do zadku aj ja!"', 627, 2.56, 43),
	(9885, 'Víte o tom, že muži měli kdysi dávno mezi nohama TRI koule?!\r\nNo, a pak si na nich tak dlouho sedeli, až vysedeli ptáka.', 127, 3.37, 43),
	(9886, 'Stoja dvaja v sprche:\r\n"Hej, ty prasa, ty si ho onanuješ !"\r\n"Ale nie.Ja si ho len tak rýchlo mydlím."', 105, 3.41, 43),
	(9887, 'Leží žena s milencom v posteli a zrazu počujú kroky v predsieni. Žena zdesene vykríkne:\r\n- Do zadku, muž ide!\r\nMilenec si unavene utrie pot z čela a povie:\r\n- No konečne, tomu to ale trvalo.', 200, 2.88, 43),
	(9888, 'Čo povie bača ovci, keď ju ráno uvidí?\r\nPlesne ju po zadku a povie: - Ej, keby si ešte vedela variť.', 107, 2.97, 43),
	(9889, 'Dvaja pedofili v parku:\r\n- Pozri na tú štvorročnú kočku, to je baba.\r\n- Pch... To si ju mal vidieť pred dvomi rokmi.', 122, 2.81, 43),
	(9890, 'Viete, aký je to bezpečný sex?\r\nKeď si je žena istá, že muž nepríde domov!', 83, 3.01, 43),
	(9891, '- Slečna, vy máte veľmi pekné nohy! Kedy sa otvárajú?', 59, 2.98, 43),
	(9892, 'Dcéra sa vráti domov zo svojho prvého rande celá vysmiata. Mama sa chce všetko dozvedieť a tak domŕza, čo a ako bolo.\r\n- Ale - vraví dcéra - išli sme do kina, potom do cukrárne a nakoniec do parku. A Jano mi v kuse rozprával vtipy. Na jednom som sa tak rehotala, že som skoro spadla z postele.', 307, 3.12, 43),
	(9893, 'Příde paní k doktorovi a říká mu že se nemůže ani vymočit jak ji bolí. Doktor se ptá:\r\n"Tak co ste dělala."\r\n"Skoušela jsem to se slonem ."\r\n"No a co."\r\n"Bylo to dobré dokáť mě nezačal prstit."', 212, 2.23, 43),
	(9894, 'Roľnícke družstvo si objednalo najnovší model dojacieho zariadenia. Jeden starý mládenec večne nadržaný prišiel z návrhom aby si to namiesto na kravské vemená nasadili na vtákov, vraj to musí byť ohromná labuž.Chlapi poslúchli a zapli zariadenie. Keď už boli všetci hotoví, nevedeli to ani sňať z vtákov ani vypnúť. Kričia na predsedu, ktorý práve prišiel, aby im to vypol. Keď sa to ani jemu nepodarilo a chlapi už zavýjali od precucania, tak volá výrobcobi zariadenia : "Prosím Vás mi sme dnes kúpili Vaše dojacie zariadenie a nevieme ho vypnúť. Ako sa to robí."\r\n"To netreba vypínať, to sa po piatich litroch vypne samo."', 671, 3.55, 43),
	(9895, 'Nova verzia Viagry: Viagra D - bude sa podávať dôchodcom, aby sa neskotúľali z postele.', 92, 2.57, 43),
	(9896, 'Čo je najväčšia samoľúbosť?\r\nVykrikovať pri orgazme svoje meno.', 71, 3.1, 43),
	(9897, 'Viete, ktoré ženy sú aerodynamické?\r\nTie, ktoré nekladú odpor.', 68, 3.01, 43),
	(9898, 'Přijede borec s autem k benzince a vidí zaměstnance, jak onanuje s použitím tý hadice co vede vod toho stojanu. Chvilku na něj nevěřícně kouká a pak povidá: \r\n"To je normál?" \r\nA chlápek se na něj otočí s blaženým výrazem ve tváři a řiká: \r\n"Ne, to je super. Ab-so-lut-ně SUPER!"', 305, 2.83, 43),
	(9899, '- Čaves,Fero!Máš rád sex v trojici?\r\nSamozrejme!\r\n- Tak bež rýchlo domov!', 79, 3.03, 43),
	(9900, 'Viete prečo boh vymyslel Adamovy ženu?\r\nLebo Adama už bolela ruka.', 69, 2.74, 43),
	(9901, 'Žena mužovi:\r\n"Miláčik, máš ho ako cukrík"\r\nMuž žene:\r\n"Taký je sladký?"\r\n"Nie, čim ho cmúľam, tým je menší!"', 126, 3.87, 43),
	(9902, 'Čo je to paradox?\r\nKeď Karkulka dostane vka od studenej trávy po vyspatí sa s horárom.', 91, 3.09, 43),
	(9903, 'Kamarátka hovorí svojmu priateľovi:\r\n"Odchádzam od teba !. Povedali že si pedofil."\r\n"Hej a nie je to trochu silné slovo na desaťročné dievčatko ?"', 157, 3.08, 43),
	(9904, 'Z léčení  je propušten:alkoholik,kuřák a homosexuál.\r\nNež opustí ústav,doktor jim říká:\r\n"Ty kuřáku,jestli si dáš ješte cigaretu tak umřeš,ty alkoholiku jestli si dáš ješte panáka tak umřeš a ty homosexuále jestli budeš mít pohlavní akt tak taky umřeš."\r\nKdyž jdou po ulici tak alkoholik uvidí stánek s levným alkoholem,dá si panáka a umře.Jde dál kuřák a homosexuál a tu vidí kuřák na zemi nedopalek a v tom mu homosexuál říká:\r\n"Jestli se ohneš tak umřem oba."', 514, 3.06, 43),
	(9905, '"Slečna, bojíte sa búrky?"\r\n"Nie, prečo?"\r\n"Lebo ja ho mám ako hrom."', 74, 2.81, 43),
	(9906, 'Farár sa chystá na dovolenku tak sa nechá zastúpiť novým, mladým farárom. A tak mu vysvetľuje:\r\n"Keď niekto urobí malý hriech dáš sa mu pomodliť 5-krát očenáš. Ak niekto zhreší stredne ťažko dáš sa mu pomodliť 10-krát očenáš, no a keď niekto zhreší strašne ťažko tak 20-krát očenáš. A ak niečo nebudeš\r\nvedieť, tu je miništrant on vie všetko, jeho sa spýtaj."\r\nFarár odíde a nový neskúseny farár si sadne do spovednice, keď tam príde mladá žena.\r\n"Otče zhrešila som. Mala som orálny sex s jedným mužom."\r\nFarár si nie je istý čo jej má dať, tak sa spýta miništranta:\r\n"Hej ty ! Čo dáva starý za orálny sex?"\r\n"Čo ja viem ? Komu ako. Mne Fidorku."', 718, 3.6, 43),
	(9907, 'Chlap príde v bare za ženou a hovorí:\r\n"Slečna, ja Vám to tak urobím, že na to v živote nezabudnete. Tak Vám to ešte nikdy nikto nespravil."\r\nŽena sa zatvári zdesene a vykríkne:\r\n"Preboha, do oka nie!"', 214, 2.86, 43),
	(9908, 'Anička a Janko sedia na lúke plnej kvetov a pozerajú sa, ako si to rozdáva býk s jalovičkou.\r\nAnička sa pýta Janka: \r\n- Janko, ako ten býk vie, že to jalovička chce?\r\n- Býk to vycíti.\r\n- A ty máš nádchu?', 219, 3.37, 43),
	(9909, 'Jano ide s Ančou súložiť za kultúrny dom.\r\nAko tak súložia, Anča skríkne:\r\n"Ungh, ungh."\r\n"Čo, už si hotová?"\r\n"Nie, niekto mi prešiel bicyklom cez krk."', 166, 3.35, 43),
	(9910, 'Chlapík príde do bordelu a do izby ho pozve stará, škaredá ženská a vraví:\r\n- Neboj sa, toto je najstaršie remeslo na svete. \r\n- Veď hej, ale prečo musím späť so zakladajúcou členkou?', 199, 3.2, 43),
	(9911, '- Prečo sa červenáš, Anička?\r\n- Ja len tak. To je dnes v móde.', 68, 2.86, 43),
	(9912, 'Príde zajac za doktorom a hovorí:\r\n- Horár mi odstrelil guľky. Prišite mi nejaké.\r\nDoktor:\r\n- Mám len býčie...\r\n- To nevadí.\r\nTak mu ich prišije. O niekoľko dni sa stretnú a doktor sa pýta:\r\n- Tak ako?\r\n- Ale celkom dobre, len ma trochu vynáša v zákrutách.', 274, 3.42, 43),
	(9913, '- Mám kvapavku.\r\n- Aj ja.\r\n- Žartujem.\r\n- Teraz už nebudeš.', 63, 3.15, 43),
	(9914, 'Nemám nič proti sexu pred svadbou... ale dve minúty?', 55, 3.04, 43),
	(9915, 'Přijde muž do bordelu. Přistoupí k němu bordelmáma a ptá se jaké má přání. Muž odpoví:\r\n"Chtěl bych nějakou slečnu s velkejma prsama a malým přirozením."\r\nZa chvíli se bordelmáma vrátí a na celý bar zavolá:\r\n"Ten pán s velkejma rukama v malým pinďourem na pokoj č.11"', 297, 3.01, 43),
	(9916, 'Bača pasie ovce. Na opačnom svahu na ceste stopuje stopárka. Zastane jej zahraničné auto, ona vloží hlavu do okna, šofér jej zacvakne hlavu do okienka, obehne auto a babu zozadu pretiahne. Bača sa poškrabe po hlave a hovorí:\r\n"Na také auto nemám, ale také dvere si kúpim."', 288, 3.07, 43),
	(9917, 'Manželský párik v posteli:\r\nON: "Drahá pomilujme sa."\r\nONA:"Nie, teraz som bola v sprche a zajtra aj tak idem ku gynekológovi a bolo by to..."\r\nPo chvíľe ticha:\r\nON: "Ale k zubárovi nejdeš?"', 199, 3.46, 43),
	(9918, 'Kocúr ozlomkrky naháňa mačku.\r\n- Kocúr, neblázni, veď ja nie som myš!\r\n- A kto povedal že som hladný?', 111, 3.05, 43),
	(9919, 'Hovorí chlap kamarátovi:\r\n- Včera som bol na svadbe mojej kolegyni z práce. Vieš, akého má žiarlivého manžela? Tancoval som s ňou slaďák a on ju kopol do rozkroku. \r\n- A čo sa jej stalo? \r\n- Jej nič, ale mne zlomil tri prsty!', 240, 4.15, 43),
	(9920, 'Aký je "speed limit" pri sexe?\r\n68...pri 69 sa treba otočiť.', 63, 2.9, 43),
	(9921, 'Prídu dvaja opití do bordelu a bordelmama má iba jednu pracovníčku. Rozmýšľa. Tomu menej opitému dám živú a tomu druhému nafukovaciu. Keď sa potom zídu tak ten čo mal nafukovaciu hovorí druhému:\r\n"Počúvaj, ja som sa asi miloval so strigou, lebo keď som ju kusol do riti tak vyletela von oknom."', 315, 3.54, 43),
	(9922, 'Starší žid sa oženil s mladou dámou a mali sa veľmi radi. Avšak nezávisle od toho, ako sa starý pán snažil, jeho manželka nikdy nedosiahla orgazmus. A kedže židovská manželka má nárok na sexuálne uspokojenie, obrátili sa o radu k rabínovi. Rabín si vypočul ich otázku, pohladil si bradu a navrhol: \r\n- Najmite švárneho mladíka. A keď sa budete milovať, nech mladík nad vami máva uterákom. To pomôže vašej manželke fantazírovať a určite dosiahne orgazmus.\r\nTak sa vrátili domov, že vyskúšajú rabínovu radu. Najali pekného mladíka a povedali mu, nech nad nimi máva uterákom, keď sa budú milovať. Ale vôbec to nepomohlo a manželka nebola uspokojená. Zničení sa vrátili k rabínovi. \r\n- Dobre, povedal ten manželovi, tak to vyskúšajte opačne. Nech sa mladík miluje s vašou ženou a vy nad nimi mávajte uterákom. \r\nZasa sa vrátili domov a nasledovali rabínovu radu. Mladík si ľahol do postele s manželkou a starý pán začal mávať uterákom. Mladík sa s vervou pustil do práce a čoskoro manželka dosiahla obrovský orgazmus. Manžel sa usmial, víťazoslávne sa pozrel na mladíka a hovorí: \r\n- Vidíš ty šmak, tak sa má mávať uterákom!', 1217, 3.62, 43),
	(9923, 'Pri grupáku jeden nespokojný vraví:\r\n"Kto to tu organizuje, už tri krát som fajčil a ani raz som si nezasúložil."', 121, 2.94, 43),
	(9924, 'Jano sa chváli svojmu kamarátovi Ferovi:\r\n- Včera som sa prvý krát miloval.\r\nFero sa pýta:\r\n- Tak čo? Aké to bolo?\r\n- Dobré, ale so ženou je to vraj lepšie.', 167, 2.85, 43),
	(9925, 'Prečo je vzduch podobný sexu?\r\nLebo neznamená veľa pokiaľ ho nemáš.', 74, 2.99, 43),
	(9926, 'Viete prečo sa blondínka pri fotení tak veľmi usmieva?\r\nČaká, kým vyletí vtáčik.', 90, 2.96, 43),
	(9927, 'Cestujú mladomanželia vo vlaku. Zrazu vojdu do tunela, vo vlaku zavládne tma a výjdu z neho až po niekoľkých minútach. Mladomanžel sa prihovára svojej holubičke:\r\n- Keby som vedel, že je ten tunel taký dlhý, tak by som ťa pomiloval!  \r\n- Aaa, to si nebol ty?', 273, 3.13, 43),
	(9928, 'Pesimista tvrdí:\r\n- Všetky ženy sú obyčajné pobehlice!\r\nOptimista sa zadušuje:\r\n- Joj, len aby si mal pravdu.', 116, 3.44, 43),
	(9929, 'Leží takhle večer dva kluci ve stanu a najednou se jeden z nich ptá:\r\n"Spíš?"\r\n"Nespím, nespím."\r\n"Mrskáš si péro, že?"\r\n"Mrskám, mrskám."\r\n"A nechce se Ti postavit, že?"\r\n"Nechce, nechce."\r\n"Tak si mrskej svoje!"', 228, 3.48, 43),
	(9930, 'Jsou takhle nějací sportovci na soustředění, bydlí v hotelu. Na jednom z pokojů jsou tři kluci, když najednou tam přijde uklízečka a začne uklízet. Hoši si jí začnou všímat, jelikož se jim líbí. Ona, vědoma si svých kvalit, se jich zeptá:\r\n"Hoši, vy byste mě chtěli, že jo?"\r\n"Jo jo, to by sme teda chtěli."\r\n"Tak víte co, uděláme to takhle. Vy mi dáte nějakou hádanku a když ji\r\nneuhodnu, tak jsem vaše."\r\nTak jeden z kluků dá hádanku:\r\n"Je to červený a na zádech to má sedm černých teček. Co je to?"\r\nSlečna se zamyslí a pak řekne:\r\n"Tak to bude Mercedes."\r\n"To je špatně," řeknou hoši a vrhnou se na ni.\r\nNo k večeru se po té uklízečce začne shánět správce, a když se tři dny\r\nneobjevuje, tak začnou prohledávat celý hotel, až přijdou k tomu pokoji, tam klečí kluci na kolenou, sepjaté ruce a prosí:\r\n"Řekni beruška, řekni beruška!"', 913, 3.27, 43),
	(9931, 'Chlap a ženská se seznámí na večírku a skončí v posteli. Když je po tom, ženská se ptá:\r\n"Prosím Vás, a nemáte náhodou AIDS?"\r\n"AIDS? Ne, chraň pánbůh, to opravdu nemám."\r\n"No to jsem si oddychla. Už jsem se bála, že bych to chytila podruhý."', 266, 3.18, 43),
	(9932, 'Jeden osmdesátiletý děda takhle zašel do svého oblíbeného baru, kde si padl do oka s jednou moc šarmatní dámou v použitelném věku. K půlnoci sjeli k ní a zalezli do postele. Stařík se snažil seč mohl, ale nepodařilo se mu dojít k vyvrcholení. Pár dní potom si všiml, že se mu na konci penisu objevila divná kapka. Šel tedy k doktorovi. Ten se ho ptal, jestli někdy v poslední době měl pohlavní styk. Děda přiznal, že ano. A doktor říká:\r\n"A víte, jak se ta žena jmenuje a kde bydlí?"\r\n"Jasně, že jo," povídá stařík.\r\n"Tak byste sebou měl hodit a sjet za ní. Každou minutou budete hotovej."', 640, 3.21, 43),
	(9933, 'Šéf pristúpi k sekretárke a začne ju obchytkávať po prsiach. Sekretárka sa pýta:\r\n- Šéfe, čo to robíte?\r\n- Predstavte si, že týmito gombičkami chytáme rádio Rakúsko.\r\nSekretárka ho zozadu chytí za rozkrok a povie:\r\n- No šéfe, touto anténou by ste nechytili ani Žilinu.', 293, 3.08, 43),
	(9934, 'Na verejných záchodoch je na automate na kondómy ceduľka \r\n"Odpovídá britským předpisům."\r\nPod tým je vyrytý nápis:\r\n"To Titanik taky odpovídal."', 158, 3.39, 43),
	(9935, 'Tri najväčšie klamstvá na Slovensku:\r\nĽúbim Ťa!\r\nNevystriekam sa ti do úst!\r\nTú faktúru som už zaplatil!', 115, 3.45, 43),
	(9936, 'Mladej mamičke sa v pôrodnici narodí čierny chlapček s blond vlasmi a šikmými očami. Pôrodník jej dohovára: \r\n- Mamička, ale nemali by ste to už viac preháňať s tým skupinovým sexom!\r\nMamička na to odpovedá: \r\n- Prečo, pán doktor, veď sa nič také zlé nestalo. Ja som skôr mala strach, že to bude štekať.', 333, 2.7, 43),
	(9937, 'Chlapík leží v posteli so ženou a milujú sa. Keď skončia, pýta sa:\r\n- Aký som bol?\r\n- No nič moc. \r\n- Tak to ťa teda nechápem. Ako môžeš po pár minútach robiť také ďalekosiahle závery?', 205, 2.84, 43),
	(9938, 'Červená Čiapočka sa pýta starej mamy:\r\n- Stará mama, prečo máš také veľké uši?\r\n- Som už stará, aby som lepšie počula.\r\n- A prečo máš také veľké oči?\r\n- Som staršia, aby som lepšie videla.\r\n- Stará mama, a prečo máš také veľké ústa?\r\n- Vieš, Čiapočka, vnučka moja, lebo dedko ho mal veľkého ...', 334, 3.57, 43),
	(9939, 'Príde pán vo veku k doktorovi a vraví:\r\n- Pán doktor, ja som trojnásobný impotent.\r\nDoktor sa pýta: \r\n- Ako tomu mám rozumieť?\r\n- Jednoducho. Porezal som si prst na cirkulárke a ešte som si obaril aj jazyk na horúcej káve.', 235, 2.89, 43),
	(9940, 'Ona: - Nechaj ma tak, mám svoje dni.\r\nOn: - Tak sa s ním aspoň pohraj.\r\nOna: - Bolí ma hlava.\r\nOn: - Posypal som ho Ibuprofenom...', 134, 3.12, 43),
	(9941, 'Aké sú hlavné nevýhody prechodu letného času na zimný.\r\nPredtým sa mi postavil doma, teraz až v autobuse.', 114, 3.81, 43),
	(9942, 'Príde žena k lekárovi, že ju má moc veľkú. Ten jej povie aby sa vyzliekla a on ju prezrie. Žena sa rozkročí a keď ju jej lekár roztvoril, padla mu tam pinzeta. Najprv jej tam strčil celú ruku, potom hlavu, potom tam vošiel celý. Po hodine blúdenia v nej stretne 2 robotníkov a pýta sa ich: \r\n"Nevideli ste tu moju pinzetu!".\r\nRobotníci sa začnú strašne smiať a jeden mu povie:\r\n"Ty blázon však mi tu hľadáme už dva roky traktor!".', 459, 3.23, 43),
	(9943, 'Na polícii vyšetrovali prípad znásilnenia družstevníčky a medziiným sa jej pýtali:\r\n- Čo bolo pri tom znásilnení najhroznejšie?\r\n- Keď mi blato z gumákov napadalo do očí.', 187, 2.72, 43),
	(9944, 'U gynekológa:\r\n"Pán doktor mám stále studené stehná, môžete s tým niečo urobiť?"\r\n"A vadí Vám to?"\r\n"Mne ani nie, ale manžel má stále zápal stredného ucha."', 174, 2.87, 43),
	(9945, 'Príde Fero za sekretárkou Ančou a hovorí jej:\r\n"Anča počúvaj keď ti dám stovku, ukážeš mi prsia?"\r\n"No dobre, zíde sa."\r\nA ukáže mu.\r\n"A počúvaj keď ti dám päťstovku ukážeš mi aj zadok?"\r\n"Dobre."\r\n"A keď ti dám tisícku, ukážeš sa mi aj dole z predu?"\r\n"Fíha, to je pekný peniaz, tak dobre."\r\n"A keď ti dám päťtisícku, pomiluješ sa so mnou?"\r\nNo prachy sa vždy zídu, tak sa sním pomiluje a Fero odíde. Potom prišiel šéf a pýta sa:\r\n"Anča bol tu Fero?"\r\n"Bol."\r\n"Héj, a dal ti výplatu?"', 534, 3.37, 43),
	(9946, 'Sedí dedko \'dole bez\' na priedomí. Príde za ním vnúčik a pýta sa:\r\n- Dedko, prečo tu sedíš od pol pása dole nahý?\r\n- Ále vieš, vnúčik môj, včera som tu sedel od pol pása hore nahý, stuhol mi chrbát, no a toto je výmysel tvojej babky!', 255, 3, 43),
	(9947, 'Na rande sa Žofka s obdivom pozerá na Jožinove nové švajčiarske hodinky.\r\n- Páni, Joži, to sú hodinky. Už sa nečudujem, že na ne v kuse hľadíš.\r\n- No to sú ti super hodinky. Nielenže mi povedia koľko je hodín hocikde na svete, ale aj to, že nemáš na sebe nohavičky.\r\n- Asi sú pokazené, lebo ja veru nohavičky na sebe mám!\r\nNato Jožino znechutene pokrúti hlavou:\r\n- Do kelu, zase idú dopredu.', 421, 3.47, 43),
	(9948, 'Viete, ktorá fyzikálna jednotka je chlapom najviac sympatická?   \r\nSeKunda.', 78, 2.37, 43),
	(9949, 'Manžel hovorí po noci vášne svojej žene:\r\n- Tak som rád, že sa ti to páčilo.\r\nŽena:\r\n- Preboha, to si bol ty?', 119, 2.89, 43),
	(9950, '- Monika, je už dnu?\r\n- Nie, nie je.\r\n- To je zaujímavé, ani vonku nie je...', 79, 3.25, 43),
	(9951, 'Dedo príde do erotického salóna a zaplatí si orálny sex. Keď mu to slečna už pol hodiny robí a dedovi sa nepostavil, prestane a opýta sa: \r\n- Dedo, veď vám sa nechce postaviť!\r\n- Ty ho nemáš postaviť, ty ho máš očistiť!', 239, 3.14, 43),
	(9952, 'Dedko po dlhých rokoch dostane chuť na sex. Kým však dôjde do izby za starkou, je po chuti. Stane sa to dvakrát, trikrát až sa dedko nahnevá a hovori babke:\r\n- Počuj, keď ma uvidíš cez okno rýchlo bežať smerom k domu, bez váhania si vykasaj sukne a buď pripravená.\r\nO dva dni, smerom od maštale beží dedko cez dvor ako divý. Babka neváha, zdvihne sukne a poďho na postel čakať dedka. Ten však pribehne a začne jej nadávať:\r\n- Čo ti šibe? Krava je na zdochnutie a ty teraz myslíš na sex!', 521, 3.45, 43),
	(9953, 'Chlapík, by sa rád miloval so ženou v čo najvyššom štádiu tehotenstva.\r\nJeho kamarát stretne tehotnú ženu, ktorej navrhne,že keď sa vyspí s jeho kamarátom, tak dostane za to zaplatené. Žena rozmýšľa a odpovie: \r\n"Dobre, peniaze sa mi hodia, veď dieťa je na ceste."\r\nA pristúpi na to. Stretnú sa, a idú rovno na vec. Chlapík sa ale asi 15 minút špára v jej vagíne. Ženu to začne znervóznovať a tak sa ho pýta:\r\n"Čo to robíš, veď sme sa mali milovať?"\r\n"Počkaj, najprv mu musím nastaviť zadoček!"', 538, 2.29, 43),
	(9954, 'Manželka sa vráti domov z viactýždňového pobytu v kúpeľoch, ľahne si k svojmu manželovi do postele a hovorí: \r\n- Konečne spolu.\r\n- To je pekné, že som ti tak chýbal.\r\n- To som nehovorila tebe, ale svojim nohám.', 226, 3.24, 43),
	(9955, 'Ktoré tri veci  ako  prvé urobí Eskimák, keď sa po dlhej dobe vráti z lovu domov?\r\n1. pomiluje svoju ženu\r\n2. pomiluje svoju ženu\r\n3. dá si dolu lyže', 159, 2.88, 43),
	(9956, 'Po sexe: \r\n- Ivanka, to bolo skvelé.\r\n- Lepšie by to bolo, keby si držal hubu. \r\n- Prečo?\r\n- Pretože nie som Ivanka.', 121, 3.69, 43),
	(9957, '- Pán doktor, mám strašne horlivého muža, ktorý to všade chce.\r\n- Na tom nie je nič zlé, aspoň má o vás záujem.\r\n- Práve včera som stála pri práčke, on priskočil a od zadu...\r\n- Čo je na tom také čudné?\r\n- Pán doktor, nehnevajte sa, ale v Tescu?', 269, 3.32, 43),
	(9958, 'Viete, prečo sú niektoré ženy pri milovaní ako zmrazené?\r\nPretože ležia pod nulou!', 90, 3.02, 43),
	(9959, 'Príde chlap domov úplne namol, vojde do spálne a hovorí manželke:\r\n"Božka, mám chuť na sex!"\r\n"Dnes to nejde, dnes mám svoje dni"\r\nChlap ju neposlúchne a vrhne sa na ňu. Keď je po všetkom, ide do kúpelne. Keď pozrie na svoje ruky od krvi, vydesene vykríkne:\r\n"Preboha, ja som ju zabil!"\r\nKukne do zrkadla.\r\n"Preboha, ja som ju i zožral!"', 354, 3.37, 43),
	(9960, 'Na súde: \r\n- Človeče, je to už váš 40-ty pokus o znásilnenie. Som zvedavý, kedy sa vám to už konečne podarí.', 120, 3.22, 43),
	(9961, 'Přijde žena do hotelu a chce pokoj. Recepční ji odmítá s tím, že není\r\nnic volného. Žena se nedá, že pújde spát třeba na púdu nebo do kurníku. V tom recepčního napadne, že na jednom čtyřlužáku jsou jen tři hosté, co čert nechtěl, samozřejmě chlapi. A tak ji to ubytování\r\nnabídne. Žena souhlasí a jde za nahoru. Chlapi ji samozřejmě nadšeně\r\nuvítají, ale mají podmínku. Budou ji dávat hádanky a když neuhodne,\r\ntak se s autorem pomiluje. Tak začnou. Ráno přijde recepční do pokoje a kouká. Na jedné posteli chlap v bezvědomí, na druhé chlap v bezvědomí a na třetí muž obštastňujíci ženu ze zadu a v rytmu přiražení říká:\r\n"Je-to-zr-za-vý-a-le-ze-to-po-stro-mech. Ře-kni-ve-ver-ka-ty-kra-vo-ne-bo-tě-za-bi-ju".', 784, 3.66, 43),
	(9962, 'Sobota ráno, Bratislava - Krížna. Stará prostitútka ešte furt na rohu ulice. Čo keď sa ešte niečo pritrafí. A zrazu červený žigulák pribrzdí, chlapík sa vykloní a pýta sa jej:\r\n- Kočka, čo spravíš za 1500?\r\nA stará vytešene odpovedá.\r\n- Ha, za 1500 bársčo. \r\nChlap na to:\r\n- Výborne. Tak sadaj a ideme murovať.', 340, 3.65, 43),
	(9963, '"Pán doktor, poraďte mi niečo, moja žena mi ho nechce vyfajčiť a ja to mám tak rád!" \r\n"Viete čo?. Skúste si ho natrieť Nutelou!"\r\nO pár dní neskôr pri náhodnom stretnutí:\r\n"Tak čo? Pomohla tá Nutela?"\r\n"Ó, a ešte ako! Bolo to niečo fantastické! Niečo úžasné!"\r\n"Naozaj? A čo na to vaša žena?"\r\n"Žena? Nič! Tá o tom nevie! Deti ju predbehli!"', 374, 2.82, 43),
	(9964, 'Manželia sa dohodli, že na prilepšenie, ona pôjde šlapať a on jej bude robiť pasáka. Keď už boli na ulici, on schovaný za rohom, pristavila pri nej veľká limuzína, spustilo sa okno a černoch vo vnútri sa pýta :\r\n"slečna. Koľko stojí u vás fajka?"\r\nŽena beží za mužom za roh a pýta sa koľko má pýtať za vyfajčenie.\r\n"Nooo. Pýtaj tak dve tisícky!"\r\nČernoch kývol hlavou: \r\n"A jedno číslo koľko?" \r\n"5 tisíc!"\r\n"Tak dobre, môžte mi ho vyfajčiť?!"\r\nKeď ho vybral z nohavíc, žena zhíkla, utekala za roh a vraví\r\n"Počúvaj, starý, nemáš náhodu požičať tri tisícky?"', 616, 3.1, 43),
	(9965, 'Pekná mladá slečna kráča po ulici. Mladý muž sa jej pýta:\r\n- Slečna, kam kráčajú tie pekné nohy? \r\n- Ak sa medzi ne nič nepripletie, tak do kina.', 159, 3.1, 43),
	(9966, 'Príde černoško domov zo škôlky a sťažuje sa rodičom, že sa mu deti vysmievajú, že on je čierny a jeho rodičia biely. Mamka si ho vezme na kolená a začne vysvetľovať: \r\n"Vieš, pred piatimi rokmi sme boli s tvojím ockom na takej výbornej párty. Samozrejme niečo sa vypilo, no a po polnoci sa to strhlo tak, že môžeš byť rád, že nie si pes!"', 367, 3.64, 43),
	(9967, 'Manželka hovorí svojmu manželovi:\r\n– Počúvaj, čo si to za chlapa?\r\n– Čo?\r\n– Sused svoju ženu uspokojí za noc až päť krát.\r\n– Hej? Tak to dokážem aj ja. To predsa nemôže byť problém.\r\nVečer vbehol muž do postele, miloval sa so svojou ženou dvakrát za sebou, potom si chvíľočku pospal, potom sa opäť spoločne milovali, opäť trošku pospal a po piatom milostnom kole, keď sa už zobudil a zistil, že je skoro obed, utekal do práce a šéfovi sa ospravedlňuje.\r\n– Sorry šéfko, že idem neskoro, sorry.\r\nA šéf hovorí:\r\n–N o mne je to jedno Fero, že idete neskoro, ale kde ste boli v pondelok, utorok a stredu?', 657, 3.46, 43),
	(9968, 'Prečo je pre mladých chlapcov dobré čítať Playboy?\r\nZlepšuje sa im koordinácia ruka - oko.', 98, 3.53, 43),
	(9969, 'Príde dedko do bordelu, zaplatí a ide hore do izby, kde ho čaká poskytovateľka služby. Tej sa však dedko nepáči a začne pred ním utekať. Dedko vybehne za ňou na chodbu a kričí:\r\n- Pretiahnite ju, je to zaplatené!', 228, 3.06, 43),
	(9970, '- Kedy sa tvoja žena najviac vzruší?\r\n- Keď ju jemne hryziem na bradavky. A tvoja?\r\n- Keď si poutieram topánky do záclony.', 129, 2.93, 43),
	(9971, '- Vidíš tú ženu?\r\n- Hej a čo?\r\n- Veď je ako klietka. Iba vtáka do nej!', 77, 2.97, 43),
	(9972, 'Stretnú sa dve prostitútky. Jedna sa pýta druhej:\r\n- Koľko si dnes zarobila?\r\n- 6020 korún.\r\n- Od koho si dostala 20 korún?\r\n- Akože od koho? No predsa od každého!', 172, 3.03, 43),
	(9973, 'Aký je rozdiel medzi kurníkom a záchodom?\r\nNo v kurníku vajcia ležia a v záchode visia.', 93, 3.24, 43),
	(9974, 'Rodičia s dieťaťom u doktora:\r\n"Pán doktor, ten náš malý má ešte len sedem rokov a už onanuje."\r\nDoktor si ho posadil na kolená:\r\n"Ako sa voláš, chlapček?"\r\n"Janko."\r\n"A koľko máš rôčkov?"\r\n"Sedem."\r\n"Taký malý a už onanuješ?"\r\n"Onanujem."\r\n"Máš recht. Na ozajstnú súlož si ešte primladý."', 319, 3.11, 43),
	(9975, 'V posteli:\r\n"Ty budeš určite anesteziológ."\r\n"Ano, ako si to poznala?"\r\n"Že nič necítim."', 95, 3.49, 43),
	(9976, 'V tlačenici pred hotelovým výťahom mládenec nechtiac buchol mladé dievča lakťom do prsníka:\r\n"Prepáčte, slečna! Ak máte aj srdce take mäkké, ako prsia, tak mi určite odpustíte."\r\n"Odpúšťam vám. A pre prípad, že máte všetko také tvrdé, ako lakte, bývam na čísle 318."', 296, 3.35, 43),
	(9977, 'Chlap sa zobudí po opici, hlava duní, v hube jak v polepšovni, kosti ako dolámané, mechúr plný, tak sa horko-tažko zdvihne, dokrivká na WC a keď si uľavuje, hovorí vyčítavo:\r\n"Vidíš, keď sa chce tebe, ja vždycky vstanem."', 239, 3.33, 43),
	(9978, 'Na zlatej svadbe sa manželia zhovárajú:\r\n"Musím sa ti priznať, že som ťa tri razy oklamala. Prvý raz to bolo s riaditeľom jednej banky, keď nám nikde nechceli dať pôžičku na dom."\r\n"Máš odpustené, tie peniaze sa nám vtedy moc hodili. A s kým to bolo druhý raz?"\r\n"Keď si raz nutne potreboval operáciu a nikde ťa nechceli operovať, musela som takto presviedčat jedného primára."\r\n"Ďakujem ti drahá, že si mi vtedy zachránila život! A kedy bol ten tretí raz?"\r\n"Pamätáš sa, ako si raz kandidoval do miestneho zastupiteľstva a chýbalo ti ešte 250 hlasov?."', 593, 3.48, 43),
	(9979, 'Definícia gynekológa: \r\nJe to muž, ktorý hľadá problémy tam, kde všetci normálni muži hľadajú potešenie.', 117, 3.6, 43),
	(9980, 'Tri priateľky prostitútky sa medzi sebou chvália:\r\n"Ja som za jednu noc urobila z chlapa impotenta!"\r\n"A ja som za jednu noc urobila z impotenta chlapa!"\r\n"A ja dokážem za minútu jazykom poskladať rubikovú kocku!"', 221, 3.3, 43),
	(9981, 'V Odešskom prístave sa vynorí mladá morská panna s dieťaťom na rukách:\r\n"Prosím vás, neviete kde býva potápač Žorík?"', 132, 3.25, 43),
	(9982, 'Hovorí jeden slovák druhému:\r\n- Počúvaj, ja som s ňou bol na rande. Hneď po prvý raz sa dokonale predviedla!\r\n- A čo potom?\r\n- Potom jej došiel benzín!', 162, 2.61, 43),
	(9983, 'Vlak vojde do tunela a odrazu sa ozve ženský výkrik:\r\n- Tu sa ktosi miluje... Bože... dokonca so mnou!', 106, 3.42, 43),
	(9984, 'Na južnom Slovensku:\r\n- Gizike, pod ondieť.\r\n- Nem értem, ale idem!', 70, 3, 43),
	(9985, 'Príde muž do drogérie a hovorí predavačke:\r\n- Prosím si kabátik na chlapčeka.\r\nPredavačka mu podá balíček prezervatívov a vraví:\r\n- Tu máte kabátik a keby ste chceli aj kožušinový golier, tak o šiestej končím.', 231, 3.63, 43),
	(9986, 'Somrák na lavičke v parku s fľaškou v ruke. Prisadla si k nemu nejaká žena.\r\n"Šlapka, hrkneš si vína?"\r\n"No dovoľte! Ja nie som žiadna prostitútka!"\r\n"Tak prečo lezieš do mojej postele?"', 200, 3.39, 43),
	(9987, 'Telefonujú si dve priateľky:\r\n"Ty si hovorila, že máš rada vtáčie mlieko."\r\n"Áno. Prečo sa pýtaš?"\r\n"Tak príď ku mne. Mám tu dvoch sokolíkov."', 157, 3.41, 43),
	(9988, 'V noci hovorí babka:\r\n"Dedko, ako to, že ho máš dnes taký hrubý?"\r\n"Preložil som si ho napoly."', 102, 3.35, 43),
	(9989, 'Bývaju traja chlapi v jedom byte a jedného dňa príde jeden z nich a položí pred ostatných 200 Sk, aby išli popiť, že večer bude mať dámsku návštevu. Ráno sa chlapi vrátia a pýtajú sa ho ako dopadol. \r\n- No bolo fajn.\r\n- A koľko krát??\r\n- Tri.\r\n- A ona??\r\n- Tri.\r\n- Hmmmm dobre.\r\nPo týždni príde iný z nich a položí na stôl 1000 Sk s tou istou požiadavkou. Ráno sa ho opäť pýtajú ako dopadol.\r\n- No bolo super.\r\n- A koľko krát???\r\n- Šesť.\r\n- A ona???\r\n- Šesť.\r\n- Hmmmm dobre.\r\nPo ďalšom týždni príde tretí chlapík a položí na stôl 10 000 Sk s rovnakou požiadavkov. Ráno ostatný opäť vyzvedajú ako bolo.\r\n- No 9 krát.\r\n- Oooohhhhh\r\n- A ona???\r\n- Ona neprišla.', 715, 3.52, 43),
	(9990, 'Žena má doma troch milencov a vtom príde manžel. Prvý beží do kúpeľne, druhý do kuchyne a tretí sa schová do brnenia na chodbe. Prvý kričí z kúpeľne:\r\n- Pani, tu vodovodnú batériu máte opravenú.\r\nA odíde. Druhý kričí z kuchyne:\r\n- Pani, ten vypínač máte opravený.\r\nA odíde. Tretí stojí v brnení pred manželom a pýta sa:\r\n- Dobre idem na Sitno?', 378, 3.47, 43),
	(9991, 'Príde babka k doktorovi a hovorí:\r\n"Pán doktor, viete, ja by som sa chcela milovať ako za mlada, aby krv striekala, chlpy lietali."\r\n"No dobre babka, tak poďte dozadu za plentu."\r\nBabka ide za plentu, a potom jej doktor hovorí:\r\n"Babka, a o týždeň príďte na kontrolu!"\r\nBabka príde o týždeň na kontrolu a hovorí:\r\n"Jáj, pán doktor, tak ste mi pomohli! Ako za mlada! Krv stieka, chlpy lietajú!"\r\n"No dobre babka, tak poďte za plentu nech vám vyberiem tú žiletku."', 485, 3.3, 43),
	(9992, 'Jeden bača vraví druhému: \r\n- Jáj včera som obšťastňoval pod bralom jednu slečinku a na kopci stála jej mama!\r\nA ten druhý: \r\n- Ježiš a čože vravela?\r\n- BEEEEEE.', 176, 3.3, 43),
	(9993, 'Na JRD je deň výplaty.\r\nMara prehadzuje seno v stodole, príde za ňou Jano a začne ju nahovárať.\r\n- Marienka, ak mi ukážeš prsia dám ti 500 korún. \r\nMara neodolá a ukáže. Jano škamre ďalej.\r\n- Marienka, ak mi ukážeš stehná, dám ti 500 korún. \r\nMara neodolá a ukáže. Tak to išlo ďalej a ďalej. Spokojná Mara si upravuje sukňu, striasa seno z blúzky, keď príde za ňou predseda. \r\n- Mara, bol tu Jano?\r\n- Bol, prečo?\r\n- Len sa tak pýtam, lebo som ti po ňom poslal výplatu.', 507, 3.8, 43),
	(9994, 'Príde Snehulienka do chalupky, a prosí o nocľah, že ju macocha naháňa.\r\nNa druhý deň sa chváli najstarší trpaslík:\r\n- Chlapi, dal som si s ňou rande v komore, to bola noc! Ja som sa spravil tri krát a ona štyri krát.\r\nDruhý deň ráno hovorí druhý trpaslík:\r\n- Chlapi neuveriteľné. Dali sme si rande v komore. Fantázia. Ja som sa\r\nspravil dva krát a ona tri krát.\r\nTak to ide ďalej.\r\nSiedmy deň sa ráno všetci pýtajú najmladšieho Kýblika:\r\n- No čo, ako?\r\n- Chlapi, super, super! Dal som si s ňou rande v komore. Ja som sa spravil päť krát, hoci ona neprišla!', 597, 3.19, 43),
	(9995, 'Ak hovorí muž žene o sexe je to sexuálne obťažovanie, ak hovorí žena mužovi o sexe je to 65,- Sk za minútu.', 117, 3.29, 43),
	(9996, 'V kupé:\r\n- Slečna, prečo stále mlčíte?\r\n- Pretože chcem.\r\n- Tak ona chce a mlčí!', 89, 3.38, 43),
	(9997, 'Sedia dvaja milenci na lavičke. Milujú sa. Ona povie:\r\n"Miláčik, daj si prosím ťa, dole ten prsteň, škriabe ma." \r\n"Miláčik, ale to nie je prsteň, to sú hodinky."', 174, 3.49, 43),
	(9998, 'Príde baník do verejného domu a pýta sa:\r\n- Aké služby ponúkate?\r\n- Ponúkame oral i anál.\r\nRozmýšľa a odpovie: \r\n- A Budvar nemáte?', 144, 3.5, 43),
	(9999, 'Príde chlapík do drogérie a jemným, tichým hláskom hovorí:\r\n- Prosím si jednu niveu.\r\nPredavačka sa ho na to pýta: \r\n- A prečo to hovoríte tak potichu?\r\nChlapík tichým hláskom"\r\n- Pretože ju nepotrebujem na ruky.', 228, 3.21, 43),
	(10000, 'Hovorí chlapík v nočnom bare atraktívnej slečne:\r\n"Nechcete sa zahrať so mnou na mágiu?"\r\n"A to je ako?" - pýta sa ona.\r\n"Pôjdeme ku mne domov, ja vás pretiahnem a vy potom zmiznete."', 193, 4.14, 43),
	(10001, 'Pýta sa honelník baču.\r\n- Bača, vaša žena bola v Paríži? \r\n- Nie, to som ju naučil ja.', 95, 3.27, 43),
	(10002, '"Slečna, môžem sa za 10$ chvíľu na vás pozerať?"\r\n"Nech sa páči."\r\n"A za 20$ by som vás mohol pobozkať?"\r\n"Ako si prajete."\r\n"A za 50$ by som si mohol pohladkať vaše poprsie?"\r\n"Kľudne."\r\n"A koľko by stálo, keby som sa chcel s vami vyspať?"\r\n"Ako obvykle, 5$ za číslo."', 288, 3.15, 43),
	(10003, 'Po divokom mejdane sa chlap zobudí vedľa cudzej ženy a pýta sa:\r\n- Doboha, koľko máš rokov?\r\n- Predsa toľko, na koľko vyzerám!\r\n- Ma neser, tak dlho človek nežije!', 175, 3.52, 43),
	(10004, 'AKO KTO MILUJE:\r\nMurár - od základov\r\nCukrár - sladko\r\nZáhradník - kvetnato\r\nKnihár - neviazane\r\nLetec - prelietavo\r\nSlepý - nevídané\r\nHluchý - neslíchané\r\nMechanik - jemne\r\nÚčtovník - vypočítavo\r\nRiaditeľ - direktívne\r\nLekárnik - po kvapkách\r\nKapelník - od podlahy\n\r\nA vy?', 295, 3.35, 43),
	(10005, 'Chlap nabalil žensku, všetko sa vyvíjalo priaznivo, ale v kritickom okamihu sa mu nechcel postaviť. Skúšal si to sám, ale nič nepomáhalo. Nakoniec z každej strany uviazal jednu ceruzku a súlož prebehla viac-menej uspokojivo. Akurát po akte hovorí jeden pysk druhému:\r\n"Človeče, už som zažil hrubého aj tenkého, dlhého aj krátkeho, ale prvý raz som ho videl na nosítkach!"', 396, 3.48, 43),
	(10006, 'Banda chuligánov v tmavej uličke prepadla mníšku a rad radom ju všetci znásilnili. Keď ju opustili, vztiahla ruky k nebu:\r\n"Ďakujem ti, Hospodine, že som si mohla užiť dosýta a bez hriechu."', 202, 3.02, 43),
	(10007, 'Na spovedi:\r\n"Otče, poznám jedno pekné dievča a neustále myslím len na To."\r\n"To je hriech, synu. Pomodli sa 10 otčenášov a bude ti odpustené."\r\n"Raz som prišiel k nej domov, ale nebol tam nikto okrem jej sestry, tak som sa s ňou pomiloval."\r\n"To je veľký hriech, synu. Pomodli sa 20 otčenášov a bude ti odpustené."\r\n"Raz som bol za ňou v práci a nebol tam nikto okrem jej šéfovej, tak som sa s ňou tiež pomiloval."\r\n"To je veľký hriech, synu. Pomodli sa 30  otčenášov a bude ti odpustené."\r\n"Potom som zase išiel k nej domov a nebol tam nikto okrem jej otca. Tak som sa s ním pomiloval."\r\n"To je veľký hriech, synu. Pomodli sa 40  otčenášov a bude ti odpustené."\r\n"A potom som zase išiel k nej domov a nebol tam nikto okrem... Otče! Prečo sa utekáte schovať sa za oltár?"\r\n"Uvedomil som si, synu, že keď si sa prišiel spovedať, nebol v celom kostole nikto okrem mňa."', 917, 3.93, 43),
	(10008, 'Mladík si to rozdával doma s nejakým dievčaťom, keď sa neočakávane vrátili jeho rodičia. Čo si kto pomyslel, keď sa otvorili dvere:\r\nOn:    Hneď som hovoril, že máme ešte počkať.\r\nOna:   Teraz si ma už určite vezme.\r\nOtec:  Aleže podrástol, chlapec. Možno už je čas kúpiť mu aj motorku.\r\nMatka: Ako to pod ním leží?! Veď mu to, chudáčikovi, musí byť strašne \r\nnepohodlné!', 408, 3.23, 43),
	(10009, 'Žena je na gynekologickom vyšetrení. Doktor má natiahnutú rukavicu a \r\nvyšetruje, keď tu zrazu zazvoní telefón. Druhou voľnou rukou berie telefón, tu v rukavici nevyťahuje. Niekto chce vedieť cestu do ordinácie, tak mu vysvetľuje:\r\n"Najprv prejdete cez park, potom obídete okolo školy, potom sa \r\ndáte doprava, asi 100 metrov rovno, potom doľava."\r\nKeď položil, pacientka hovorí:\r\n"Pán doktor, prosím vás, môžete to vysvetliť ešte raz? Hlavne tú časť \r\nokolo školy?"', 499, 3.01, 43),
	(10010, 'Po veľmi krátkej súloži hovorí chlap žene:\r\n"Keby som vedel, že si bola panna, neponáhľal by som sa tak."\r\n"Keby som ja vedela, že máme čas, stiahla by som si pančuchy!"', 182, 3.26, 43),
	(10011, 'Už ťa niekto prichytil na záchode ako si to robíš sám?\r\nDobrá skrýša, čo???', 85, 3.18, 43),
	(10012, 'Ako zistite, že má ísť prostitútka do dôchodku?\r\nKeď sa prepadne cez barovú stoličku!', 94, 2.87, 43),
	(10013, 'Koľkokrát v živote sa hanbí žena?\r\nTri krát...\r\n1. Keď to robí prvý krát.\r\n2. Keď si za to prvý krát nechá zaplatiť.\r\n3. Keď za to prvý krát platí ona.', 170, 3.09, 43),
	(10014, 'Pýta sa 10-ročná 12-ročnej:\r\n<10>" Čo ti to tu rastú za guličky, Alenka?"\r\n<12>" To sú prsia, Radka."\r\n<10>" Hmmm... A nezavadzia ti to pri súloži?!', 158, 3.37, 43),
	(10015, 'Ide chlapík po ulici a chce sa mu čúrať, tak to oprie o najbližší roh. Idú okolo starší ľudia a vravia:\r\n- Oooo, aká hrubosť.\r\nA muž na to:\r\n- A čo poviete na dĺžku?', 182, 3.11, 43),
	(10016, 'Na brehu rieky stojí pán ,pred ním kovadlina na nej jeho vták a búši doňho kladivom. Druhý sa ho pýta, čo robí.\r\n"Onanujem."\r\n"??? a kedy pociťujete rozkoš ????"\r\n"Keď netrafím."', 193, 3.09, 43),
	(10017, 'Dedko príde do erotického salónu a zaplatí si "orálnu" masáž. Počas jej priebehu sa pýta masérky: \r\n- Aký ho mám? \r\nOna mu hovorí: \r\n- Ako cukrík, čím ho viac cmúľam, tým je menší.', 201, 3.01, 43),
	(10018, 'Janko je na dovolenke v Amsterdame. Ako prvé sa ide pozrieť do erotického masážneho salónu. Príde dnu a pýta sa masérky: \r\n- Čo to stojí?\r\nMasérka mu odpovedá: \r\n- 25 guldenov na posteli a 2,5 guldena na zemi.\r\nJanko jej dá 25 guldenov. Masérka sa pýta: \r\n- Tak teda 1 krát na posteli?\r\n- Nie, 10 krát na zemi.', 328, 3.19, 43),
	(10019, 'Prepracovaný manager vpáli ráno do kancelárie a hovorí sekretárke:\r\n- Tak Klára, aký dnes mme deň?\r\n- Prosím, neplodný, pán šéf...', 144, 2.88, 43),
	(10020, 'Príde priateľ k priateľovi a ten si umýva penis zubnou kefkou.\r\n"Čo to robíš?"\r\n"To len tak preventívne ako ochranu pred paradentózou."\r\n"Vieš, ide z úst do úst."', 174, 3.09, 43),
	(10021, 'Za kultúrnym domom súloží Jožko s Božkou.\r\nBožka: "Ungh! Ungh!"\r\nJožko: "Čo? Už si hotová?"\r\nBožka: "Nie, niekto mi prešiel bicyklom cez krk."', 155, 3.49, 43),
	(10022, 'Viete, čo je vrchol nevery?\r\nKeď  muža podvádza manželka s milenkou.', 73, 2.68, 43),
	(10023, 'Milá Sally, píšem ti, lebo mám veľký problém. Strašne mi smrdí prirodzenie a to je pre mladé dievča hotová tragédia. Poraď, čo robiť? Tvoja Eva.\n\r\nOdpoveď:\r\nRob menšie kroky. Tvoja Sally.', 205, 3.16, 43),
	(10024, '"Deti, čo všetko sa dá zjesť?"\r\n"Bla, bla, bla svetlo."\r\n"??? Vysvetli."\r\n"No včera večer som išiel okolo spálne a počul som ako mamička hovorí oteckovi:"\r\n"Zhasni svetlo a daj mi ho do ust."', 202, 3.21, 43),
	(10025, 'Dvaja muži sa chvália, kto má dlhšie prirodzenie. Prvý hovorí:\r\n- Ja mám dvadsaťosem!\r\nDruhý hovorí: \r\n- A ja tridsaťsedem!\r\n- Fíha! Si dobrý! A čím si si to meral?\r\n- Teplomerom!', 194, 2.81, 43),
	(10026, 'Manželé středního věku si z nedostatku financí zařídili tržní ekonomiku i v sexu. Za jedno milování na koberci 30 Kč, na gauči 50 Kč a na pohodlném a prostorném letišti 100 Kč.\r\nPo tydnu :\r\nOna: "Už to nemúžu vydržet, tady máš stovku a jdeme rychle na to."\r\nOn : "Už běžím, miláčku, jenom připravím naše roztomilé hnízdečko lásky, naše krásny letište."\r\nOna: "Žádny letište! Třikrát na koberci a deset korun hned vrátiš!"', 469, 3.36, 43),
	(10027, 'Čo je horšie ako slon v obchode s porcelánom?\r\nNo predsa ježko v obchode s kondómami!', 90, 3.02, 43),
	(10028, 'V posteli:\r\n"Drahá cítiš aké je to dlhé?"\r\n"Mhm, cítim."\r\n"Drahá, cítiš aké je to tvrdé?"\r\n"Fantasticky."\r\n"Miláčik, cítiš, aké je to hrubé?"\r\n"Je to nádherné."\r\n"Zlatíčko, cítiš aké je to teplé?"\r\n"Oh, áno."\r\n"To všetko som iba pre teba nasral."', 273, 2.83, 43),
	(10029, 'Päťdesiatročná žena telefonuje do redakcie časopisu Chovateľ:\r\n- Dobrý deň, prosím vás, poraďte mi čo mám robiť? Plzne mi činčila.\r\nZdvihne to nejaký chlap a hovorí:\r\n- Nejazdi na bicykli, ty krava.', 217, 2.76, 43),
	(10030, 'Ležia manželia v posteli a oddávajú sa sexu. On sa jej pýta: \r\n- Ty jsi se zľakla? \r\n- Nie, prečo?\r\n- Že si sa pohla!', 125, 3.32, 43),
	(10031, 'Pristane mimozemštan na salaši, ide za bačom a takto mu rečie:\r\n"Bača, keď mi ukážeš niečo, čo som ešte v živote nevidel, darujem ti sto kíl zlata."\r\nBača sa zamyslí a ukazuje mimozemšťanovi televízor. Ten kývne rukou a hovorí:\r\n"Ale bača, veď to sme u nás mali v minulom storočí."\r\nNato bača chytí mimozemšťana za ruku a ukazuje mu lietadlo, ktoré práve letí po oblohe.\r\n"Bača, to nemyslíš vážne, hovorí mimozemšťan, veď to som videl keď som bol batoľa."\r\nNato vstúpi do situácie bačova žena a vezme mimozemšťana zo sebou do izby. O chvíľu mimozemšťan vybehne a vyloží pred bačovu kolibu sto kíl zlata a rýchlo odletí. Bača sa pýta ženy:\r\n"Čo si mu ukázala?"\r\n"Ále, iba kapučína."\r\n"To je čo?", pýta sa bača.\r\n"Nič moc, žaluď do huby a predkožka cez hlavu."', 833, 3.86, 43),
	(10032, 'Dedko hovorí vnúčikovi:\r\n- Dám ti 100 korún, keď ukradneš otcovi tú modrú tabletku čo má na nočnom stolíku.\r\nTak sa aj stalo a na druhý deň dáva dedko vnúčikovi 500 korún a vnúčik mu hovorí:\r\n- Dedko to ale nie je sto korún.\r\nDedko na to:\r\n- Stovku máš odo mňa a štyristo máš od babky.', 314, 3.51, 43),
	(10033, 'Muž sa miluje so ženou, ale jej to v kuse nič nerobí. Muž sa snaží, snaží, skúša všetky polohy, ale žena stále nič. Tak muž rozmýšľa, ako by ju mohol nejako vzrušiť. Po chvíli ho napadne, že skočí na ženu zo skrine. Žena len pokrčí plecami. Muž sa teda vydriape na skriňu a skočí na ňu. Zrazu žena začne vrieskať, prežije najlepší orgazmus v živote a povie mužovi:\r\n- Choď ešte raz. \r\nA muž nato:\r\n- Počkaj len si nohu vytiahnem.', 475, 3.31, 43),
	(10034, 'Muž po spoločnej noci s neznámou:\r\n- Keby som vedel, že si bola panna, nebol by som taký rýchly.\r\nOna na to:\r\n- Keby som vedela, že si taký rýchly, nedala by som si nohavičky.', 185, 3.32, 43),
	(10035, 'Mladá žena leží v pôrodnici. Práve porodila. Gynekológ jej vraví: \r\n- Mladá pani, v budúcnosti by ste sa mali vyhýbať tomu skupinovému sexu. \r\n- A čo sa stalo? - informuje sa mamička. \r\n- No, narodil sa vám černoško s ryšavými vlasmi a modrými očami.\r\n- Áno?! A šteká? \r\n- To nie. \r\n- Chvalabohu.', 321, 3.3, 43),
	(10036, '- Ale už toho nechaj! Hovoril si, že ma len trošku prstíčkom pošimráš po pupíku. Ale toto už nie je pupík.\r\n- Však ťa ani nešimrám prstíkom...', 158, 3.32, 43),
	(10037, 'Príde opitý chlap večer domov. Otvorí spálňu a vidí svojho najlepšieho kamaráta, ako si to rozdáva s jeho ženou. Chvíľu sa zamyslí a hovorí:\r\n- Feri, Feri! Ja musím, ale tebe sa čudujem.', 203, 3.11, 43),
	(10038, 'Čitateľka sa pýta časopisu chovateľov drobných zvierat: "Plzne mi činčila, čo mám robiť?"\r\nOdpoveď z časopisu: "Prestaňte jazdiť na bicykli."', 156, 3.06, 43),
	(10039, 'Janko a Marienka idú po lese a Janko hovorí:\r\n- Marienka poďme sa milovať, ja som to ešte nikdy nerobil.\r\nMarienka povedala, že dobre a tak si to rozdali.\r\nKeď už je po tom, Janko sa pýta:\r\n- Marienka, prečo sa ti pri tom dvíhali chodidlá?\r\n- Pretože si bol prvý, ktorý sa so mnou miloval cez silonky.', 316, 3.46, 43),
	(10040, 'V preplnenej električke začal jeden z cestujúcich zozadu obšťastňovať šťavnatú slečnu, a to priamo do rytmu jazdy po koľajniciach. Slečna spozornela, potom sa k nemu otočila a hovorí: \r\n"Pane, vy ma milujete zozadu?" \r\n"Iste, a čo má byť?" pýta sa muž. \r\n"No spýtať sa hádam môžem, nie?"', 312, 3.52, 43),
	(10041, 'Superman si letí po meste a v jednom mrakodrape vidí nahú ženu.\r\nLen si tak pomyslí, že keby ju v tej rýchlosti pomiloval, ani by si to nevšimla.\r\nTak tam vletí a v izbe ostane iba prievan.\r\nA žena sa pýta svojho muža.\r\n"Miláčik, čo to bolo?"\r\n"Neviem, ale bolelo to."', 283, 3.25, 43),
	(10042, 'Stretnú sa 3 dievčatá a dohodnú sa, že si usporiadajú večierok. Prvá má zabezpečiť byt, druhá jedlo a pitie a tretia chlapov. Po týždni sa stretnú a prvá hovorí:\r\n- Baby, mám bomba byt, veľký, nikto nás tam nebude rušiť, no skrátka super...\r\nDruhá: \r\n- A ja som zabezpečila toľko alkoholu a jedla, že nám ešte týždeň bude od prežratia zle...\r\nA tretia hovorí: \r\n- A ja som zohnala 48 chlapov. \r\nPrvé dve sa zhrozia: \r\n- Preboha, načo toľko chlapov???\r\nA ona kľudne odpovedá:\r\n- No ako poznám chlapov, polovica z nich nepríde, ako poznám chlapov, tak polovica z nich sa ožerie, ako poznám chlapov, tak polovica z nich nebude môcť. No a čo keby sme chceli dvakrát???!!!', 716, 3.49, 43),
	(10043, 'Šestnásťka ide na svoje prvé rande a má isté pochybnosti čo a ako. Matky sa pýtať hanbí a tak pre istotu ide za babkou, nech jej poradí.\r\n- Ej, dcérenka moja, musíš si dávať dobrý pozor na dnešných mladých chlapcov. Chcú všetko naraz. Najskôr sa ťa pokúsi pobozkať, tebe sa to bude páčiť, ale nenechaj ho. Potom sa ťa pokúsi chytať za poprsie, tebe sa to bude páčiť, ale nenechaj ho. Potom sa ti pokúsi vsunúť ruku medzi nohy, tebe sa to bude páčiť, ale nenechaj ho. Ale najväčší pozor si dávaj, keď sa bude chcieť vyšplhať na teba. To mu vôbec nedovoľ, lebo pripravíš našu rodinu o česť a dobré meno.\r\nNa druhý deň ona pribehne za babkou:\r\n- Mala si pravdu vo všetkom. Ale nenechala som ho pripraviť našu rodinu o dobré meno. Vyšplhala som sa ja naňho a teraz jeho rodina príde o česť.', 855, 3.47, 43),
	(10044, 'Manžel sa predčasne vráti domov zo služobnej cesty. Manželka v spálni prosí milenca, aby vyskočil z okna, lebo ich manžel zabije, keď ich nachytá. Problém však je v tom, že spálňa je na 13-tom poschodí. Milenec si pomyslí: "Nuž, keď musím zomrieť, je to jedno ako". A vyskočí. Cestou nadol prosí pána Boha: "Pane Bože, už nikdy nebudem chodiť za inými ženami, už budem svojej žene verný, už nebudem smilníkom, atď... Daj, aby sa mi nič\r\nnestalo."\r\nDopadol na zem a zázrakom sa mu nič nestalo. Vstane, otrepe sa a povie: \r\n- Toľko hovadín za takú krátku chvíľu som už dávno nenatrepal.', 632, 3.23, 43),
	(10045, 'Lekár poučuje budúceho otecka:\r\n- S vašou tehotnou ženou sa môžete milovať, ale odporúčam vlčiu polohu.\r\n- A to je aká?\r\n- Ľahnúť si vedľa diery a zavýjať.', 173, 3.46, 43),
	(10046, 'Leží to pod smrekom a slastne vzdychá. Čo je to?\r\nPredsa pani Smreková. \r\nLeží to pod Novákom a slastne vzdychá. Čo je to?\r\nPani Nováková?\r\nFigu, zasa tá stará štetka Smreková.', 192, 3.39, 43),
	(10047, 'Bača Ondro, naozaj je pravda, že ste ho za mladi mali taký, že ste ho museli obomi rukami cez koleno ohýňať?!\r\n- Tak veru, synku, tak bolo...\r\n- A teraz už neohnete, čo he-he. \r\n- Nuž veru, neohnem... ruky sa slabie! ', 227, 3.3, 43),
	(10048, 'U gynekológa.\r\n- Teda milostivá, čo ste to vyvádzali, veď ste z vnútra sama trieska?\r\n- No to viete, pán doktor, keď ten môj je strašné drevo.', 153, 3.1, 43),
	(10049, 'Manžel príde predčasne domov a načapá manželku so susedom v posteli.\r\n- Ty beštia, ja som to vedel! Ja som to vedel!\r\nManželka s kľudom:\r\n- No a on to ešte stále vie.', 177, 4.09, 43),
	(10050, 'Aký je rozdiel medzi dobrým susedom a dobrou susedkou?\r\nDobrý sused požičia, dobrá susedka dá.', 101, 3.05, 43),
	(10051, 'Prišiel Fero za Mišom a narhuje mu:\r\n- Spravme si gruppensex!\r\n- Dobre! A kto do toho pôjde? - opýta sa Mišo.\r\n- Ty, ja a tvoja žena!\r\n- Nesúhlasím! - protestuje Mišo.\r\n- Dobre, tak teba škrtám...', 207, 3.34, 43),
	(10052, 'Janko píše Marienke z vojny:\r\n- Ak budem v sobotu mocť, tak prídem!\r\nMarienka posiela telegram:\r\n- Budeš mocť! Príď!', 124, 3.14, 43),
	(10053, 'Dvaja sú po milovaní.\r\nMuž sa pýta opatrne ženy: \r\n"Počúvaj, Ty máš astmu?"\r\nŽena odpovedá: \r\n"Nuž, bolo mi trápne Ti to predtým povedať, mám!"\r\n"To je v poriadku" - hovorí muž -"ja som sa trápil, že si ma vypískala".', 238, 3.59, 43),
	(10054, 'Po náhodnej známosti a rušnej noci sa dievčina od neho lúči so slovami: "Ahoj!"\r\nA hojil tri mesiace.', 107, 3.32, 43),
	(10055, 'Otázka: Na malom bielom podklade je sedem malých dierok. Čo je to? \r\nOdpoveď: Panenská blana Snehulienky. \n\r\nOtázka: Sedem malých a jedna väčšia? \r\nOdpoveď: Prišiel princ. \n\r\nOtázka: Sedem malých, jedne väčšia a jedna najväčšia? \r\nOdpoveď: Prišiel na koni.', 278, 3.36, 43),
	(10056, 'Stretnú sa tri prostitútky. Prvá hovorí:\r\n- Ja som musela ísť za päťdesiat korún, aby som mala čo jesť.\r\nDruhá nato: \r\n- Ja som musela za dvadsať, aby som mala aspoň čo piť.\r\nTretia sa chytá za hlavu a hovorí:\r\n- Ja som musela ísť zadarmo, aby som mala aspoň niečo teplé v ústach.', 304, 2.93, 43),
	(10057, 'Viete, aká je najhlúpejšia otázka, ktorú môžete položiť prostitútke?\r\n"Si ešte panna?"', 97, 3.21, 43),
	(10058, 'Dvaja sa milujú.\r\nOn vraví:"Drahá, zmeňme polohu."\r\nOna:"Nie drahý, lebo keď ho zo mňa vytiahneš,príde rýchly Fred a začne sa so mnou milovať."\r\nOn:"Neboj sa drahá, keď ho s teba vytiahnem, rýchlo ti tam strčím prst a rýchly Fred nebude mať šancu."\r\nA tak sa aj stalo. On ho z nej vytiahol...\r\n... a strčil prsty do zadku rýchleho Freda.', 359, 3.48, 43),
	(10059, 'Rozprávajú sa Američan, Nemec a Arab. Američan: \r\n- Mám 4 synov, ešte si urobím jedného a mám basketbalové družstvo. \r\nNemec na to: \r\n- Mám 10 synov, ešte jeden a bude futbalové mužstvo. \r\nArab sa zasmeje a hovorí: \r\n- Mám 17 žien. Ešte si vezmem jednu a mám golfové ihrisko.', 296, 3.53, 43),
	(10060, 'Manželia majú oddelené spálne. Zrazu sa na manželkinej spálni otvoria dvere: \r\n- Ty si bol večer zase sexovať, že? \r\nManžel sklopí zrak a nesmelo prikývne. \r\n- Tak nabudúce ma aspoň utri!', 201, 2.8, 43),
	(10061, 'Manžel prekvapí svoju ženu v posteli s iným mužom. Manžel zdesene zvolá:\r\n- Čo to tu robíte?\r\nA žena sa s myknutím pleca obráti na milenca:\r\n- Vidíš, hovorila som ti, že nemá o tom ani poňatia!', 210, 3.31, 43),
	(10062, 'Janko hovorí Aničke:\r\n- Zlatko moje, vyzeráš ako klietka. \r\n- Prečo Janko?\r\n- Len vtáka do teba.', 102, 3.4, 43),
	(10063, 'Marienka rozkročí nohy a vraví Jankovi:\r\n- Janko, strč mi tam prst!\r\nJanko strčí.\r\n- Janko, strč ešte jeden!\r\nJanko strčí.\r\n- A teraz celú ruku!\r\nJanko strčí celú ruku.\r\n- A teraz druhú!\r\nJanko strčí aj druhú.\r\n- Janko, a teraz zatlieskaj.\r\n- Marienka, nemôžem, nedá sa.\r\n- No vidíš! A stále mi vravíš, že ju mám veľkú!', 349, 3.71, 43),
	(10064, 'Vedci robili výskum a prišli na to, že ženské pohlavie nosí v sebe inteligentné bunky. Bohužial 95% z nich ich vypľuje.', 128, 3.32, 43),
	(10065, '- Mami, ako som prišiel na svet?\r\n- Bocian ťa priniesol, synček.\r\n- A ocko?\r\n- Taktiež ho priniesol bocian.\r\n- A babka?\r\n- Aj babku priniesol bocian.\r\nChlapček odíde do svojej izby a do zošita napíše: "V našej rodine sa už 70 rokov ľudia nemilujú."', 261, 3.2, 43),
	(10066, 'Čo je maximálne nešťastie? \r\nKeď manželka aj milenka majú menštruáciu v ten istý týždeň.', 101, 3.09, 43),
	(10067, 'Dvaja v posteli:\r\n- Máš nejaký zvláštny kondóm? Je veľmi drapľavý.\r\n- Nemám žiadny kondóm, mám husaciu kožu. Si totiž strašne škaredá.', 152, 3, 43),
	(10068, 'Drzosť: Stretnúť tehotnú ženu a pozdraviť "Máme sa vospolok?".\r\nA potom čo je perverznosť: Podať obom ruku.', 117, 3.33, 43),
	(10069, 'Sedia traja dedkovia na lavičke a rozprávajú sa o svojom sexuálnom živote. Prvý hovorí:\r\n- Ja som na tom hrozne. Ja to robím iba trikrát do roka.\r\nDruhý hovorí:\r\n- Pch, to si na tom dobre, ja to robím iba dvakrát do roka.\r\nTretí hovorí celý šťastný:\r\n- Ja to robím iba raz do roka.\r\nTi dvaja sa ho pýtajú:\r\n- A prečo si taky šťastný?\r\n- Lebo to budem robiť zajtra.', 391, 3.25, 43),
	(10070, 'Aká je švédska trojka? \r\nDvaja chlapi a jedna žena.\r\nAká je švajčiarska trojka?\r\nDve ženy a jeden muž.\r\nAká je rumunská trojka?\r\nDvaja chlapi a jeden pes.', 165, 3.37, 43),
	(10071, '- Marusja, ľahni!\r\n- Uch, ty čort, kak ty mňa bystro ugavaril! ', 66, 3.54, 43),
	(10072, 'Aký je rozdiel medzi očami a topánkami?\r\nTopánky sa lesknú po kefovaní, oči pred.', 88, 3.2, 43),
	(10073, 'Koľkokrát stihne žena počas milostnej predohry zaklipkať očami?\r\nAni raz, lebo nestihne.', 94, 3.26, 43),
	(10074, 'Príde mladý muž do lekárne a hovorí:\r\n"Slečna magistra, prosím vás, ja by som  potreboval niečo ..., viete, ja mám taký problém, ja mám stále erekciu."\r\nSlečna mu na to hovorí:\r\n"No, tu vám teraz nepomôžem, ale môžete sa ku mne nasťahovať."', 263, 3.43, 43),
	(10075, 'Rýchly Bill sa miluje s cudzou ženou u nej doma, keď zrazu niekto zabúcha na dvere. Žena v panike hovorí:\r\n- Rýchly Bill, to je môj manžel! Rýchlo vyskoč von oknom!\r\nRýchly Bill schytí veci a vyskočí von oknom. Žena otvorí dvere a tam stojí rýchly Bill a hovorí:\r\n- Zabudol som si topánky!', 310, 3.33, 43),
	(10076, '- Keď sa tak na teba pozerám, taká si škaredá, že ani neviem, prečo sa vlastne s tebou milujem.  \r\n- No, ale voľačo vo mne musí byť predsa pekné, či nie?\r\n- Áno, máš pravdu, ale aj to bude o chvíľu už vonku...', 228, 3.25, 43),
	(10077, 'Hovorí ľahké dievča vojakovi z povolania po sexe:\r\n"Ty darebák! Okamžite zaplať, ja ti kašlem na nejakú pochvalu pred nastúpenou jednotkou!"', 150, 3.32, 43),
	(10078, 'Přistoupí muž k cizí ženě a do ouška ji pošeptá:\r\n"Krásně lížu a jsem diskrétní."\r\nOna se na něj pohrdavě podívá a odpoví:\r\n"Tak si vyliž prdel a nikomu to neříkej."', 188, 3.65, 43),
	(10079, 'Chlap vstúpi do spálne s kozou v náručí. Jeho žena leží na posteli a číta si knižku. Chlap vraví:\r\n- Pozri sa zlatko, toto je tá krava, s ktorou súložím, keď máš ty krámy.\r\nŽena mu hovorí:\r\n- Keby si nebol taký hlúpy, tak vieš, že je to koza.\r\nChlap sa usmeje:\r\n- Keby si ty nebola taká sprostá, tak si všimneš, že sa bavím s kozou a nie s tebou!', 378, 3.7, 43),
	(10080, 'Sex je ako:\r\nNOKIA CONNECTING PEOPLE,\r\nako PEPSI ASK FOR MORE,\r\nako NIKE JUST DO IT,\r\nako SAMSUNG EVERYONE IS INVITED ...', 121, 3.3, 43),
	(10081, 'Čo je to bozk?\r\nZaklopanie na poschodie, či v prízemí je voľno.', 68, 3.51, 43),
	(10082, 'Viete aký je rozdiel medzi ženou a sliepkou?\r\n - Sliepka sedí iba na svojich vajciach !', 90, 3.31, 43),
	(10083, 'Synček ide okolo spálne a počuje ocka hovoriť číslice: 1,2,3,4,5,6. Ide okolo akoby si to ani nevšimol. Na druhý deň ide okolo spálne a zas počuje ocka hovoriť: 1,2,3,4,5,6. Už nevydržal a ráno sa spýtal ocka: - Ocko čo znamená 1,2,3,4,5,6 ???Ocko odpovedá: 1 znamená, že vyzlečiem maminku, 2 znamená, že vyzlečiem seba, 3 vsunem, 4 vysunem, 5 oblečiem maminku, 6 oblečiem seba. Na druhý deň po vysvetlení ide ocko okolo synčekovej izby a počuje 1,2,3,4,3,4,3,4,3,4,3,4,3,4,3,4,3,...', 515, 4, 43),
	(10084, 'Ako žena spozná že sa miluje s mechanikom od Ferari?\r\nStihne vymeniť štyri gumy za sedem sekúnd!', 102, 3.59, 43),
	(10085, 'Lev s pribúdajúcim vekom nemohol uspokojiť levicu a tak dal v lese vyhlásiť: "Kto skočí z 50 metrovej skaly a prežije, môže sa vyspať s mojou starou..." Všetky zvieratká sa zbehli pod skalou, či sa voľakto odvážny nájde. Zrazu vidia bodku. Táto sa zväčšuje, až s rachotom dopadne na zem medveď. Vzápätí vyskočí, opráši sa a začne sa šplhať naspäť na skalu. Lev mu hovorí: "A Ty kam sa hrabeš, veď teraz sa môžeš vyspať s moju starou..." Medveď na to: "To počká... Najskôr nájdem toho, čo ma sotil..." ', 550, 3.74, 43),
	(10086, '- Viete aký je rozdiel medzi sexom a bicyklovaním?\r\n- Niee?\r\n- Tak sa len ďalej bicyklujte..', 95, 3.88, 43),
	(10087, 'V stane ležia dvaja čundráci... Ticho, tma... Zrazu sa jeden pýta toho druhého: "Ty si honíš?" Ten druhý: "Áno." Prvý: "... a nejde to, že ...?" Druhý: "... nejde..." Prvý: "Tak si hoň láskavo svojho...!"', 219, 3.94, 43),
	(10088, 'Idu dve malé spermije za veľkou sperimou a pýtajú sa jej, čo majú robiť keď už vyjdú von. Tá im poradí, aby keď uvidia jednu veľkú guľu prišli k nej, pekne zaklopali a spýtali sa, či môžu vôjsť. Natešené malé spermie už idú, idú a naraz zbadajú dve veľké gule. Rozmýšľajú  čo spraviť, a tak sa rozhodnú, že jedna pôjde k jednej a druhá k druhej. Keď tam dorazia oznámia: "To sme my spermie, môžeme dnu?"A z vnútra sa im ozve: "To sme my mandle, môžete."', 502, 3.88, 43),
	(10089, 'Príde muž domov a nájde ženu v posteli s milencom. Nahnevaný muž chytí milenca, vyhodí ho von oknom a vraví: - Ak si myslíš, že máš lepšieho vtáka, tak leť!', 173, 4, 43),
	(10090, 'Príde chlap z fitnesscentra domov a hovorí žene: "Všetky svaly ma bolia, ale to je dobre. Keď bolia, znamená to, že rastú."Žena ho kopne medzi nohy a vraví: "Tak nech rastie!"', 185, 4, 43),
	(10091, 'Viete, aký je rozdiel medzi pneumatikami a 365 použitými kondómami? Pneumatiky sú goodyear, ale kondómy sú very good year.', 129, 3.38, 43),
	(10092, 'V kine:\r\n- Dajte tú ruku preč z môjho kolena!\r\n- A kam ju môžem dať?\r\n- O kus vyššie.', 93, 3.41, 43),
	(10093, 'Aký je rozdiel medzi Jánošikom a štetkou?\r\n- Jánošík bohatým bral a chudobným dával. Štetka dáva len bohatým!', 122, 3.3, 43),
	(10094, 'Po nevydarenom milovaní ona vraví:\r\n- Tak sa mi zdá,že Silan naozaj zmäkčuje všetko.', 91, 2.82, 43),
	(10095, 'Pýta sa otec školáčika:\r\n- O čom ste sa dnes učili v škole?\r\n- O sexe.\r\n- A vedel si?\r\n- Vedel.\r\n- A čo si dostal?\r\n- Facku!', 132, 4.02, 43),
	(10096, 'Príde reportérka k farmárovi a reportérka sa ho pýta:\r\nMohli by ste mi niečo povedať o chorobe šialených kráv?\r\nViete, že býk pretiahne kravu raz za rok?\r\nReportérka zahanbená sa pýta: "A čo to má spoločné s chorobou šialených kráv?"\r\nFarmár ju nepočúva a hovorí ďalej: "A viete, že dojíme kravy 4-krát denne?"\r\nReportérka so zvýšeným hlasom hovorí: "Mohli by sme sa už konečne dopracovať k pôvodu choroby?"\r\nFarmár sa na ňu pozrie a hovorí jej: "Práve sme sa tam dopracovali. Keby som sa pohrával s vaším poprsím 4-krát denne a pretiahol vás až po roku......nezošaleli by ste z toho?"', 636, 4.15, 43),
	(10097, '- Viete prečo majú buzeranti šťastie?? - Lebo sa im víla šťastena bojí otočiť zadkom.', 95, 3.15, 43),
	(10098, 'Manželia už dlho nesexovali, preto majú pred synom na dorozumenie, že je ten správny čas slovko "ideme prať" (sexovať). Prv deň sa manžel pýta manželky: "Ideme prať???"Manželka odpovie: "Dnes nie, bolí ma hlava!!!"Takto sa to opakuje 2 týždne... Potom sa ho manželka opýta: "Tak čo??? Ideme prať???A manžel odpovie: "Nie, už som si vypral v rukách..."\r\n', 377, 4, 43),
	(10099, 'Hovorí muž doktorovi: -Pán doktor, ako mám manželku donútiť k orálnemu sexu???\r\n- Nooo, skúste Nutelu.\r\nPo týždni sa kontrol na doktore pýta pacienta:- Tak čo, ako bolo? - No vynikajúco - odpovie muž.A doktor:- A čo na to vaša žena?\r\nNeviem, deti ju predbehli.', 278, 3.59, 43),
	(10100, '- Viete čo robí ježko v továrni na kondómy?\r\n- ...\r\n- Prekvapenia.', 71, 4.21, 43),
	(10101, 'Muž sa večer pritúli k manželke, chce sa s ňou milovať. Manželka mu hovorí:\r\n- Dnes nie, bolí ma hlava...\r\nNa druhý deň sa manžel znovu pokúša. Žena ho odstrčí a povie:\r\n- Nechaj ma, som unavená...\r\nTretí deň sa manžel zas túli k manželke. Na to mu manželka vraví:\r\n- Trikrát za týždeň?! Spamätaj sa preboha, ty úchyl!', 349, 4.13, 43),
	(10102, 'Vráti sa chlap nečakane zo služobnej cesty a počuje z kúpelne divné hlasy.\r\nA tak ide ďalej a vylezie si v spálni na skriňu.\r\nManželka s milencom prídu z kúpelne a hups do postele.\r\nMilenec ju pobozká a hovorí:" Pusinku sme si dobre vykúpkali!!!"\r\nPresunie sa nižšie a hovorí: " Prsíčka sme si tiež dobre vykúpkali!!!\r\n"Potom sa presunie ešte nižšie a hovorí: " Ale-ale, tu sme sa nejako zle vykúpkali!!! ".\r\nA ženská mu na to odpovie: "\r\nPozri sa na skriňu a poserieš sa tiež!!! \r\n', 514, 4.1, 43),
	(10103, 'Príde mamka aj s malým Jožkom ku gynekológovi a gynekológ vraví: \r\n- Jožko ty radšej ostaň tu. \r\n- Ni, nie, ja o všetkom viem - vraví Jožko .\r\nTak si Jožko sadnrena stoličku a pozerá, čo doktor robí mamke. Doktor začne mamke rukami sa hrabať v pi.. a pýta sa Jožka: \r\n-No Jožko, čo teraz robím? \r\n-Kontrolujete mamke maternicu. \r\nDoktor prikývne. A začne sa mamke rukami dotýkať pŕs. \r\n-No Jožko, čo teraz robím? \r\n-Kontrolujete, či mamka nemá rakovinu prsníka. \r\nDoktor sa naštve začne je.ať mamku a pýta sa: \r\n-No Jožko, čo teraz robím? \r\n-Veľkú blbosť. Prišli sme sem, lebo mamička ma syfilis', 642, 4.29, 43),
	(10104, 'Mama hovorí jeden večer svojej 13-ročnej dcére:\r\n- Zuzka, to čo máš v nohavičkách si poriadne stráž.\r\nDcéra na to: - Neboj mami, mne na to dáva pozor Peter z vedľajšieho vchodu a každý piatok mi to kontroluje.', 226, 4, 43),
	(10105, 'Nakúpi muž v obchode kondómy rôznej arómy. Keď príde domov, hovorí žene, že bude so zaviazanými očami hádať o akú arómu sa jedná. Žena si zaviaže šatku na oči, a keď si dá muž dole nohavice, začne ochutnávať a hovorí:\r\n- Plesnivý syr. A muž na to: - Počkaj, ešte som si nenasadil...', 314, 4.16, 43),
	(10106, '- Miláčik?\r\n- Áno zlatíčko.\r\n- Srdiečko, milujem ťa. \r\n- Kvietoček aj ja teba.\r\n- A zlatíčko spravíš mi raňajky?\r\n- Samozrejme pokladík. \r\nPo chvíli...\r\n- Ani ty si nepamätáš moje meno?! ', 205, 3.97, 43),
	(10107, 'Kamarát sa sťažuje kamarátovi pol roka po sobáši.\r\n- Ty počúvaj, ja už nemôžem. Tá moja to chce stále. Ráno, na obed, večer, celú noc... Ja už nevládzem.\r\nDobrý kamarát mu odpovie:\r\n- Ja som ti vravel neber si takú škaredú, budeš na to sám.', 265, 3.86, 43),
	(10108, 'Americký film:\r\n"How do you do?"\r\n"All right!"\r\nV pozadí amatérsky preklad:\r\n"Ako si to robíš?"\r\n"Vždy pravačkou!"', 121, 3.67, 43),
	(10109, 'Chlap zbalil ženskú, všetko sa vyvíjalo priaznivo, ale v kritickom okamihu sa mu nechcel postaviť. Skúšal si to sám, ale nič nepomáhalo. Nakoniec z každej strany uviazal jednu ceruzku a súlož prebehla viac-menej uspokojivo. Akurát po akte hovorí jeden pysk druhému:\r\n"Človeče, už som zažil hrubého aj tenkého, dlhého aj krátkeho, ale prvý raz som ho videl na nosítkach!"', 396, 4.07, 43),
	(10110, 'Starý družstevník Čvirik, hrdý pracovník JRD dostal v jeden večer strašnú chuť nsa manželku, pani Čvirikovú. Nuž začali v posteli šantiť, avšak pri jednom takom skoku na pani Čvirikovú, zlomil si pán Čvirik nohu. No na druhý deň mal ísť do práce kydať hnoj, no ale nemohol, tak zavolal svojmu kolegovi Kokoškovi aby do nemocenského spisu niečo napísal. A tak Kokoška napísal: Družstevník Čvirik spadol pri sejbe semena zo starej mašiny. ', 475, 4.07, 43),
	(10111, 'Rozprávajú sa dvaja pri sexe: \r\nOna: Na to, že máš 30 nie si nejaký dobrý...\r\nOn: Na to, že máš 12 si nejaká drzá...', 128, 4.22, 43),
	(10112, 'Pri súloži:\r\nOna: Á, á.\r\nOn: Jea, jea.\r\nOna: Ááá, ááá.\r\nOn: Oh, oh.\r\nOna: Ááá, ááá, ešte, ešte.\r\nOn: uf, uf.\r\nOna: Ěšte, ešte, ešte.\r\nOn: Yes, yes.\r\nOna: Už dosť, už dosť.\r\nOn: No na čase, už to robím pol hodiny dáždnikom!\r\n', 255, 2.65, 43),
	(10113, '1.deň\r\nChalan hovorí druhému:\r\n"Keď rozhýbeš slonovi gule dám ti 500 Sk.\r\nChalan hovorí: "Dajte mi 10 kg kladivo."\r\nDajú mu kladivo a chlapec buchne slonovi po vajciach.\r\nRozhýbu sa mu.\r\n2.deň\r\nKto rozhýbe slonovi hlavu dostane 1000 Sk.\r\nPríde chalan ku slonovi a hovorí: "Dajte mi rebrík."\r\nChalan sa postaví na rebrík, pošušká slonovi do ucha: "Chceš ešte po vajciach."\r\nA slon začne kývať hlavou.', 424, 3.93, 43),
	(10114, 'Pri sexe blondínka hovorí mužovi: "No tak si rozmysli, či dnu alebo von!"', 77, 3.93, 43),
	(10115, 'Cestuje mladík vo vlaku a v kupé je spoločne s mladou ženou. Tá po nastúpení do vlaku si zoberie z púzdra husle a začne v kupé hrať. Po hodine to mladíkovi začne liezť na nervy a opýta sa mladej ženy čo to robí. \r\nOna odpovie:"Cestujem na koncert, tak musím cvičiť."\r\nMladík sa zamyslí a po chvíľke si vyberie úd a začne ním trieskať po stolčeku v kupé, na čo sa mladá žena zhrozí a pýta sa ho rovnako: "Čo to robíte?"\r\nOn odpovie: "Cestujem lebo sa idem ženiť, a preto musím cvičiť."', 527, 3.59, 43),
	(10116, 'Otec ide so synom okolo bordelu a syn sa ho pýta: "Ocko, čo je toto za dom?"Ocko sa začervená a hovorí:"To je dom radosti."Na druhý deň sa ide synček pozrieť do "Domu radosti". Na chodbe stretne kuchárku a ona sa ho pýta: "A ty tu čo robíš?""Ocko povedal, že toto je dom radosti, tak ukáž akú radosť mi urobíš!"Kuchárke to zapne a povie: "No tak poď, urobím ti radosť." A urobila mu palacinky.\r\nSynček príde domov a ocko sa ho pýta kde bol. Syn mu povedal, že v dome radosti. Ocko sa začervená a pýta sa: "A ako bolo?""No prvé dve som zvládol, ale tú tretiu som len vylízal."', 611, 4.28, 43),
	(10117, 'Rodičia sa dohodnú na krycom mene sexu, a to znie: "Ideme prať."\r\nManžel dôjde z roboty a hovorí:\r\n- Drahá poďme prať.\r\nDrahá: Dnes nie, nejde práčka.\r\nNa druhý deň sa to opakuje a na tretí deň hovorí manželka:\r\n-Drahý, môžeme ísť prať!\r\nDrahý: Netreba, už som si vypral v rukách!!!', 309, 3.76, 43),
	(10118, 'Je to malé, chlpaté a druhé písmeno v slove je i. Čo je to?\r\nKiwi.', 71, 3.4, 43),
