	(10125, 'Starý farár odišiel na dovolenku a na fare ostal už len kaplán. Do spovedelnice príde žena a spustí: „Otče, zhrešila som.“\r\nKaplán sa opýta: „A čo také si urobila?“\r\n„Mala som orálny sex.“\r\nKaplán ostane zarazený a žena sa pýta aké dostane rozhrešenie? Kaplán nevie, a tak sa spýta miništranta: „Čo dáva starý za orálny sex?“ Miništrant mu odpovie: „Neviem čo iným, ale mne fidorku.“\r\n', 436, 4.05, 43),
