	(10129, 'Troch kamarátov na výlete zastihne strašná búrka, tak sa rozhodnú prenocovať na sene v opustenej stodole. Ráno sa zobudia a začínajú sa chváliť, komu sa čo snívalo. \r\nPrvý hovorí: - Teda chlapi, za mnou prišla v noci Schifferová, pomaličky sa vyzliekla a vrhla sa na mňa. A potom znovu a znovu! \r\nDruhý hovorí: - To nič nie ...je. Za mnou prišla v noci kompletná skupina Spice Girls a kým som ich všetky neobslúžil, nedali mi pokoj! Len ten tretí, ten čo spal v strede je akýsi zachmúrený. \r\nTak sa ho ti dvaja pýtali, čo sa snívalo jemu? \r\n- Ále, zatiaľ čo vy ste si užívali s babami, ja som bol uprostred oceána v takej malilinkej lodičke a celú noc som vesloval a vesloval. A najhoršie bolo, že tie veslá mali také krátke rúčky.\r\n', 786, 3.67, 43),
	(10130, 'Keď muži hovoria ženám o sexe je to sexuálne obťažovanieKeď ženy hovoria mužom o sexe je to 1,20 € za minútu.', 122, 4.21, 43),
	(10131, 'Mladík doprovodí slečnu po schůzce před její dům. U vstupních dveří se začnou líbat na dobrou noc a mladíka to značně vzruší... Opře se dlaní o zeď, usměje se na ni a povídá: \r\n- Miláčku, co kdybys mi ho vykouřila? Zbláznil ses? Rodiče nás uvidí! \r\n- Ale prosím tě! V tuhle hodinu? Ale ne.\r\n- Dovedeš si představit, co by se stalo, kdyby nás přistihli? \r\n- Ale jdi! Nikdo tu není, vaši už spí! \r\n- Ani náhodou, je to moc nebezpečné! \r\n- Prosím, prosím, moc tě miluji?!? \r\n- Ne, ne ,ne. Taky tě miluji, ale teď nemůžu! \r\n- Jasně, že můžeš,... prosím? \r\n- Ne, ne. Fakt nemůžu. \r\n- Moc prosím.\r\nNajednou se na schodech rozsvítí světlo a ve dveřích se ukáže její mladší sestra v pyžamu ,s rozcuchanou hlavou a rozespalým hlasem povídá: \r\n- Taťka ti vzkazuje, že mu ho máš už konečně vykouřit, nebo to mám udělat já. A máma vzkazuje, že kdyby bylo třeba, tak to udělá klidně sama...jen ať už proboha sundá  ruku z toho zvonku!', 1014, 4.29, 43),
	(10132, 'Zahráme sa na kúzelníka???\r\nA to je ako??\r\nJa ťa pomilujem...a ty zmizneš!', 79, 3.61, 43),
