	(10138, 'Šofér zastaví stopárke a pýta sa jej, kam ide.\r”Do Trnavy.”\rPo desiatich kilometroch jej vraví:\r”Dnes ste už tretia, čo ide do Trnavy a je tehotná.”\r”Ale ja nie som tehotná!”\r”Veď ešte nie sme v Trnave.”', 231, 4.11, 43),
