	(10141, 'Moja priateľka ma pozvala k sebe domov. Keď som k nej došiel, našiel som tam len jej polonahú sestru... Vyzerala neuveriteľne sexy, došla ku mne a zašepkala mi do ucha: \r\nUž dlho k tebe prechovávam city, chceš sa so mnou vyspať? \r\nV tom momente som sa otočil, vyšiel von prednými dverami a šiel smerom k autu... Pred ním stála moja priateľka a povedala mi: \r\nTýmto si si získal moju dôveru... \r\nPonaučenie z tohto príbehu? Vždy majte kondómy v aute.', 475, 4.29, 43),
