	(10144, 'Na Fera sa v obchode usmieva pekná blondínka, a tak sa jej spýta:\r\nPočujte, my dvaja sa poznáme?\r\n- No možno sa mýlim, - odvetila blondínka - ale myslela som si..., že vy budete zrejme otcom jedného z mojich detí?\r\nFero začal pátrať v pamäti a spomenul si na jediný úlet, keď bol v živote neverný:\r\n- Kruci! To ste fakt vy? Tá striptérka z pánskej jazdy deň pred tým, než som sa oženil?\r\nTá ktorú som jeb*l na gulečníku, zatiaľ čo ma kamarát plieskal po riti mokrou zelerovou vňaťou?\r\n- Nie. - odpovie žena - Ja som triedna vášho syna...', 576, 4.18, 43),
