	(10148, 'Manželia hrajú golf. Pri jednom odpale preletí loptička sklom terasy blízkeho domu. Manželia, vedomí si svojej viny, sa ihneď idú majiteľovi ospravedlniť. Volajú, ale nikto im neodpovedá. Dívajú sa teda rozbitou terasou do domu a na stolíku vidia rozbitú krásnu fľašu a vedľa nej vidia stáť pomerne atraktívneho muža s turbanom na hlave.\r\n„Ste majiteľom domu?“\r\nMuž chvíľu hľadí na pár, a potom povie: „Nie, ja som bol tisíc rokov uväznený v tejto fľaši a teraz niekto odpálil golfovú loptičku, fľašu rozbil a mňa oslobodil.“\r\nManžel: „Óóó, potom ste teda duch z tej fľaše.“\r\n„Správne. Splním vám dve želania, tretie by som si, s dovolením, nechal pre seba.“\r\nManžel si teda rýchlo praje: „Super! Takže ja by som chcel plat milión eur zdanených ročne...“\r\n„Splnené! A aké je druhé želanie?“\r\nManželka: „Aby sme mali stále na stole len tie najlepšie jedlá a nápoje.“\r\n„Zaiste. No a teraz moje prianie“, hovorí duch. „Tisíc rokov som bol uväznený vo fľaši a nemal som žiadnu ženu. Prial by som si teraz užiť zvyšok dňa s vašou manželkou.“\r\nManželia rozpačito súhlasia, manžel ide na golfové ihrisko a ona s duchom do spálne. Keď boli práve v najlepšom, pýta sa duch ženy:\r\n„A aký starý je tvoj manžel?“\r\n„37.“\r\n„A to ešte verí na duchov z fľaše?“\r\n', 1395, 4.25, 43),
