	(10150, 'V lietadle po štarte ohlási veliteľ lietadla základné údaje letu. Zabudne však vypnúť rozhlas a cestujúci počujú pilota aj ďalej: ,,Tak a teraz si vypijeme kávu, po*ebeme tú novú letušku a môžeme ďalej kľudne letieť. Letuška, ktorá bola vzadu uteká do kabíny, aby vypla rozhlas. Ako ide cez uličku, jeden z cestujúcich, východniar, jej vraví: „Co tak ľeciš, ty ku*vo, šak hutoreľ, že perše vypiju kavu,ne?“', 446, 4.09, 43),
	(10151, 'Lord vbehne do kuchyne s horiacou rukou.\r\n- Čo sa vám stalo, pane?\r\n- Asi to nebol dobrý nápad s tou lampou na záchode, čo horí 48 hodín.\r\n- Prečo???\r\n- Chcel som si posvietiť či nemám sračku.', 205, 3.05, 44),
