	(10154, '"Jean, dá sa prd chytiť rukou?"\r\n"Nie pane."\r\n"Tak som sa asi posral."', 72, 3.56, 44),
	(10155, 'Lord Charles príde neskoro večer domov. Sluha James mu pomáha vyzliecť kabát a potichu si mrmle popod nos:\r\n- Tak čo, ty starý nadržaný krokodíl, zasa si bol v bare nasávať a očumovať pekne dievčatá?\r\nLord Charles mu odpovedá:\r\n- Ale nie James, dnes som si bol kúpiť načúvací prístroj.', 308, 4.05, 44),
	(10156, '- James, choď poliať kvety na záhrade.\r\n- Ale pane, veď prší.\r\n- To nevadí, zober si so sebou aj dáždnik.', 114, 3.49, 44),
	(10157, '- James, dones mi klavír!\r\n- Prečo pane?\r\n- Zabudol som si na ňom šálku.', 77, 3.13, 44),
	(10158, 'Lord Norton sedí v obľúbenom kresle v hale pred krbom vo svojom zámku na brehu Temže. Zrazu do miestnosti vbehne zadýchaný sluha James. \r\n- Pane! - v panike kričí James. - Temža vystúpila z brehov! O päť minút bude tu!\r\n- James, ty idiot, čo kričíš? - hnevá sa lord. - Nevieš ako sa má správať sluha anglického lorda? Okamžite vypadni a vráť sa až keď ti to dôjde.\r\nJames odíde. Zavrie za sebou dvere. O päť minút sa dvere otvoria. Stojí v nich James a slávnostne hovorí: \r\n- Temža! Pane!', 526, 3.16, 44),
	(10159, '- James prines mi klavír.\r\n- A môžem sa spýtať na čo pane?\r\n- James, ty predabovaný inšpektor Derick, mám tam okuliare.', 128, 3.58, 44),
	(10160, '- Z balóna vidím našu zelenú planétu. A vidím aj iné zelené planéty.\r\n- Nerád to hovorím, kapitán, ale letíme nad melónovým poľom.', 146, 4.04, 44),
	(10161, '- John, koľko je stupňov?\r\n- Šesťnásť, pane.\r\n- John a koľko stupňov je vonku?\r\n- Štyri,pane.\r\n- John, tak otvor okná, nech je tu dvadsať.', 149, 3.17, 44),
	(10162, 'Sedí lord v kresle. Príde k nemu James s čajom. Lord sa ho pýta:\r\n- Aké je počasie vonku, James?\r\n- Prší pane.\r\n- Dobre. Zoberte rybičky na prechádzku. ', 162, 3.03, 44),
	(10163, 'Keď prišiel Nikita Sergejevič Chruščov do Londýna na oficiálnu návštevu, lord Norton práve obedoval. Zrazu sa ozvala delová salva. Mykol sa a hovorí:\r\n- James, čo je to vonku za rámus?\r\n- Môj pane, prišiel k nám na návštevu sovietsky premiér Nikita Sergejevič Chruščov.\r\n- Aha, ďakujem. \r\nJedol ďalej a vtom ďalšia salva.\r\n- James, čo je to vonku za rámus?\r\n- Pane, veď som vám povedal, že k nám prišiel na navštevu sovietsky premiér Chruščov.\r\n- A čo ho netrafili prvý raz?', 514, 3.41, 44),
	(10164, 'Lord Norton hovorí Jamesovi:\r\n- James, dones mi pohár vody!\r\n- Áno pane.\r\n- James, dones mi ešte jeden pohár vody!\r\n- Vaše lordstvo ráči byť dnes veľmi smädné.\r\n- Vieš James, o niektorých ľuďoch sa hovorí, že sú taký sprostý ako vyzerajú, o tebe to neplatí James.\r\n- Ďakujem, pane.\r\n- Ty si sprostejší. Nevidíš, že horíme?', 352, 3.35, 44),
	(10165, 'James hovorí pánovi:\r\n- Pane, v knižnici sú zlodeji.\r\n- Nehovor a čo čítajú?\n', 85, 3.63, 44),
	(10166, 'Lord sedí po dobrej fazuľovej polievke vo vani a "uľavuje si". O chvíľu sa otvoria dvere a vojde lokaj s fľašou piva. Lord sa začudovane pýta:\r\n- Čo tu robíš s tým pivom?\r\nLokaj: \r\n- Ale sire, sedel som dolu v kuchyni a zreteľne som počul: Bret! Bring me big bottle of beer!', 289, 3.36, 44),
	(10167, 'Staručký lord sprevádzaný svojim sluhom sa prechádza po parku.\r\n- James, budem cikať.\r\nSluha mu ho vytiahne a jeho lordstvo sa pýta:\r\n- James, je vonku?\r\n- Áno pane.\r\n- A ciká?\r\n- Nie pane.\r\n- Tak ho schovaj.\r\nSluha mu ho schová a idú ďalej. Po chvíli sa lord pýta:\r\n- James, je vonku?\r\n- Nie pane.\r\n- Tak prečo ciká?', 333, 3.14, 44),
	(10168, '- James, povedz tým muchám na stene, že lord Northon im vznešene odkazuje HEŠ.', 83, 3.08, 44),
	(10169, 'Lord sa stretne s Lady a tá mu oznamuje:\r\n- Lord, rozhodla som sa, že budem mať dieťa.\r\nLord sa usmeje a pýta sa:\r\n- V poriadku a čo preto mám urobiť?\r\nLady:\r\n- Ďakujem, nič. James už všetko zariadil. ', 213, 3.14, 44),
	(10170, '- Mylord, v knižnici je zlodej.\r\n- A čo číta?', 49, 3.15, 44),
	(10171, '- James, strč krave chvost do zástrčky.\r\n- Prečo, pane?\r\n- Lebo mám chuť na teplé mlieko.', 96, 3.47, 44),
	(10172, 'Lord sa sprchuje a chce, aby mu Jean doniesol papuče. Jean to chce využiť a ide do kuchyne za slúžkami a hovorí: \r\n"Lord chce, aby som vás hneď teraz pomiloval."\r\nSlúžky tomu nechcú veriť a chcú dôkaz. Jean ide pred kúpeľňu a pýta sa: \r\n"Oe pene?"\r\n"No áno, hádam nie len jednu."', 299, 3.4, 44),
	(10173, '- James, prší vonku?\r\n- Áno, pane.\r\n- Tak pusť rybičky na prechádzku!', 75, 3.26, 44),
	(10174, 'Jean dobehne k lordovi a rozrušene volá:\r\n- Pane, pane! Vaša žena sa práve utopila v rybníku!\r\nLord na to:\r\n- Ale to je skvelé, Jean! Práve som rozmýšlal, čo jej kúpim na vianoce.', 191, 2.94, 44),
	(10175, '- James, dnes mám chuť pracovať. Preto si olúpem vajíčko sám.', 68, 3.25, 44),
