	(10178, 'Pán sa pýta sluhu:\r\n- Jean, má citrón nožičky?\r\n- Nemá pane.\r\n- Och, vzdychne si pán, asi som si do čaju vytlačil kanárika.', 134, 3.27, 44),
	(10179, 'Lord volá domov a pýta sa Jamesa:\r\n- James stalo sa niečo počas mojej neprítomnosti?\r\n- Áno, zlomil som lopatu.\r\n- Čože? Lopatu?\r\n- Áno, keď som zahrabával vášho psa.\r\n- Čože? Môjho psa?\r\n- Zomrel, keď Vám zhorel dom.\r\n- Čože? Zhorel mi dom?\r\n- Keď sa vaša žena dozvedela, že Vaša dcéra je tehotná, spadol jej svietnik z ruky a podpálila dom.\r\n- Čože moja dcéra je tehotná?\r\n- James máš pre mňa aj niečo pozitívne?\r\n- Áno, Váš test na AIDS.', 480, 3.75, 44),
