	(10183, '- James, prší vonku na ceste?\r\n- Neviem pane, išiel som po chodníku.', 72, 3.36, 44),
	(10184, '- James!\r\n- Áno, pane?\r\n- Kopni do steny!\r\n- Prečo, pane?\r\n- Som nahnevaný!!!', 80, 3.32, 44),
	(10185, '- James!\r\n- Áno pane!\r\n- Tu v novinách sa píše, že 80% Slovákov sú alkoholici. A tých 20% Slovákov sú čo?\r\n- Prosím pane, tých 20% sú deti do 3 rokov. ', 165, 3.18, 44),
	(10186, '- Jano, dal si koňovi žrať?\r\n- Dal, gazdíčko, dal.\r\n- A dal si mu veľa?\r\n- Dal som mu veľa.\r\n- Však si mu veľa nemusel dávať.\r\n- Však som mu veľa nedal.\r\n- Však si mu nemusel dať nič.\r\n- Však som mu ani nič nedal.', 231, 3.36, 44),
	(10187, '"-Jean! Vajíčka."\r\n"-Na mäkko alebo na tvrdo?"\r\n"-Nie, poškrabkať." ', 73, 4.17, 44),
	(10188, 'James, vie citrón spievať?\r\nNie, Pane.\r\nTak som si do čaju vytlačil kanárika.', 82, 4.04, 44),
	(10189, 'Jean, prineste mi okno!\r\nChcem sa pozrieť do Záhrady.', 55, 3.73, 44),
	(10190, 'Lord sa miluje v posteli so svojou manželkou a sluha James im pri tom asistuje tak, že stojí pri posteli a drží v ruke zapálenú sviečku. Po skončení aktu, ale lady nie je spokojná, tak lord vyzve sluhu, aby si vymenili úlohy.\r\nKeď James skončí, lady slastne vzdychá od rozkoše.\r\nSpokojný lord sa obráti na sluhu:\r\n- Vidíš, James, takto sa drží sviečka!', 376, 4.18, 44),
	(10191, 'Na 13-nástom poschodí visí žena z okna a muž ju mláti po prstoch s kladivom. Z dola sa ozve:\r\n- Hej, vy tam hore, čo bijete tú ženu po prstoch? Veď spadne.\r\nOn na to:\r\n- A vás je čo do toho? Je to vaša svokra, alebo moja?\r\n- Svokra? Ale sa drží potvora.', 268, 3.33, 45),
	(10192, '- Dobrý deň, máte kockový cukor?\r\n- Nie, nemáme.\r\n- A nejaký iný fajný dezert pre svokru?', 97, 3.06, 45),
	(10193, '- Ja tu svoju svokru tak nemám rád.\r\n- Tak zjedz aspoň zemiaky.', 66, 2.86, 45),
	(10194, 'Príde muž domov z práce a pýta sa manželky: \r\n- Dnes bola na návšteve tvoja mama? \r\n- Ano, ako to vieš? \r\n- No, lebo som opľutý na svodobnej fotke.', 157, 3.29, 45),
	(10195, 'Cez deň to šteká, v noci to pláva. Čo je to?\r\nSvokrine zuby.', 65, 3.05, 45),
	(10196, '- Čo si taky smutný?\r\n- Zomrela mi svokra.\r\n- A prečo si taky doškriabaný?\r\n- Strašne sa bránila.', 104, 3.49, 45),
	(10197, 'Obyvateľ v činžiaku zazvoní na susedovom byte. \r\n- Pán sused, váš pes dnes pohrýzol moju svokru! \r\n- Veľmi ma to mrzí, pán sused, rád vás odškodním. \r\n- Nechcem žiadne odškodnenie, ale predajte mi vášho psa!', 226, 3.4, 45),
	(10198, '- Čo robíš?\r\n- Nesiem svokre dve sliepky.\r\n- A prečo dve?\r\n- Lebo včera povedala, že by dala pol života za jednu hus.', 124, 2.88, 45),
	(10199, 'Vieš, prečo sa svokra pochováva dole hlavou?\r\nAby kopala nadol.', 66, 3.35, 45),
	(10200, 'Priatelia obdivujú trofeje poľovníka na stene a pristavia sa pri zarámovanej fotografii s úškrnom.\r\n- Prečo je medzi trofejami fotka? - pýtajú sa.\r\n- To je moja svokra. Do poslednej chvíle si myslela, že ju idem fotografovať.', 237, 3.43, 45),
	(10201, 'Väzenský dozorca väzňovi:\r\n- Máte tu svokru, čo jej mám povedať?\r\n- Povedzte, že nie som doma.  ', 105, 3.16, 45),
	(10202, '- Moja svokra je anjel. Neviem sa dočkať, kedy už zamáva krídlami a odletí do neba.', 89, 3.13, 45),
	(10203, 'Otázka na rádio Jerevan: Ak z lásky zožeriem svokru, budem považovaný za kanibala?\r\nOdpoveď: Nie, pretože vaša svokra je riadna sviňa!', 144, 3.29, 45),
	(10204, 'Aký je rozdiel medzi rakovinou a svokrou?\r\nS chorobou sa dá žiť.', 68, 3.92, 45),
	(10205, 'Na dvere klope mníška:  \r\n- Nemohli by ste niečim prispieť do domu dôchodcov?\r\n- Mohol, len počkajte chvílku, kým zbalím svokre kufre.', 143, 3.34, 45),
	(10206, 'Doktor sa pýta pacienta:\r\n- Kedy ste prestali piť?\r\nPacient odpovie:\r\n- Keď som začal vidieť svokru dvojmo.', 112, 3.37, 45),
	(10207, 'Zvoní telefón: \r\n- Uniesli sme tvoju svokru. Okamžite pošli výkupné 100 000 dolárov!\r\n- A keď odmietnem zaplatiť?\r\n- Tak ti ju naklonujeme!', 148, 3.48, 45),
	(10208, 'Vracia sa bača z mesta a keď je už neďaleko domu vidí že sa začína búrka. Keď je 100 metrov od domu, udrie blesk a zabije všetky ovce. A bača:\r\n- No toto!\r\nKeď je 50 metrov od domu udrie blesk a začne horieť dom. A bača:\r\n- No toto!\r\nKeď je 20 metrov od  domu vybehne z neho jeho svokra a v tom udrie blesk a zabije ju. A bača:\r\n- No preto!', 358, 3.6, 45),
	(10209, 'Starí známi sa stretnú po niekoľkých rokov. Rozprávajú sa, keď tu téma príde na manželky.\r\nJeden hovorí druhému:\r\n- Moja stará bola na plastickej operácii tváre a dal som jej kožu zo zadku.\r\nTen druhý hovorí:\r\n- To muselo bolieť.\r\nA on:\r\n- To hej, ale keď vidím ako ju svokra bozkáva na líce...', 318, 3.08, 45),
	(10210, 'Rozhovor v krčme:\r\n- Odborníci tvrdia, že na Slovensko ešte choroba šialených kráv nedorazila. To ale nevideli moju svokru.', 130, 3.05, 45),
	(10211, 'Viete, čo má spoločne smrť svokry a slivovica? \r\nNo, najprv vám vyrazí dych a potom máte taky príjemný pocit.', 118, 3.36, 45),
	(10212, 'V Iraku zákon mužom zakazuje, aby sa oženili so svojou svokrou.\r\nTypicky príklad úplne zbytočného zákona.', 113, 3.12, 45),
	(10213, 'Svokra má troch zaťov, preto chce vyskúšať ako ju majú radi. Keď je na dvore najstarší, skočí do studne a volá o pomoc. Najstarší zať ju vytiahne a na druhý deň zbadá pred domom novú škodu s nápisom "S vďakou svokra". Ďalší deň opäť skočí do studne a stredný zať ju tiež vytiahne. Jeho odmenou je čisto nový Renault s nápisom "S vďakou svokra". Nasledujúci deň tretí krát skočí, aby vyskúšala najmladšieho, no ten ju nevytiahne.  Ďalší deň stojí pred jeho domom BMW s nápisom "S vďakou svokor".', 547, 3.54, 45),
	(10214, 'Sused na suseda:\r\n- Sused, čo ste si kúpili nové auto? Staré sa vám pokazilo?\r\n- Áno mám pokazené centrálne zamykanie dverí.\r\n- Však to sa dá opraviť.\r\n- Dá. Ale vo vnútri ostala zamknutá svokra.', 211, 2.96, 45),
	(10215, 'Traja muži si sťažujú, aké majú ukecané svokry. Prvý: \r\n- Mne už musel predpísať psychiater upokojujúce prášky, toľko moja svokra kecá.\r\nDruhý: \r\n- U mňa to došlo tak ďaleko, že som sa kvôli tomu skoro obesil!\r\nA tretí na to: \r\n- Chlapci, to nie je nič. Ja som bol so svokrou na dovolenke a opálil sa jej tam jazyk.', 340, 3.25, 45),
	(10216, 'Príde chlapík k lekárovi a ten mu hovorí:\r\n"Podľa posledných výsledkov Vás môžem ubezpečiť, že rakovina to nie je a požijete si ešte dlho."\r\nChlapík celý natešený vybehne von kúpi si los a vyhrá milión. Od radosti volá žene a hovorí jej:\r\n"Rakovina to nie je a vyhral som milión."\r\nŽena mu hovorí:\r\n"Zomrela mi mama."\r\nChlapík zloží telefón mydlý si ruky a hovorí:\r\n"Keď to ide, tak to ide."', 426, 3.68, 45),
	(10217, '- Tvoja svokra je taká tučná, že keby mala "H" na tričku, tak tam pristávajú helikoptéry.', 97, 3.21, 45),
	(10218, '- Máte kockoy cukor?\r\n- Nie.\r\n- A nejaký iný dezert pre svokru?', 66, 3.2, 45),
	(10219, 'Syn sa pýta otca:\r\n- Otecko, prečo strieľaš na babku?\r\nOtec na to:\r\n- Niekomu babka a niekomu svokra!', 105, 3.27, 45),
	(10220, 'Čo povedal zať svojej svokre predtým ako zomrela?\r\nMohla by si byt aj lepšia, veď nato sa neumiera.', 104, 3.08, 45),
	(10221, 'Mladý novomanžel sa vracia mierne opitý z krčmy a pred dverami zbadá svokru ako tam stojí a drží v rukách metlu. Pýta sa jej:\r\n- Zametáš alebo si priletela?', 168, 3.37, 45),
	(10222, 'Vonku je strašný nečas, veľká fujavice,keď si zrazu u Novákovcov všimne manžel že niekto predo dvermi už hodnú chvíľu klope. Pobere sa k dverám. Keď otvorí dvere zbadá svokru a vraví jej:\r\n"Svokra moja a čo tu vy v takomto počasí,čo radšej nejdete domov."', 279, 3.03, 45),
	(10223, 'Rozhovor v krčme:\r\n- Odborníci tvrdia, že na Slovensko sa ešte choroba šialených kráv nedostala, ale pri pohľade na moju svokru by iste zmenili názor.', 159, 3.13, 45),
	(10224, 'Inzerát v novinách:\r\nProsím teroristu, ktorý mi zaslal ucho, dva prsty a kúsok nosa mojej svokry o ďalší dôkazový materiál.\r\nZn. Chcem predísť omylu.', 162, 2.88, 45),
	(10225, 'Súdne pojednávanie vo veci vraždy svokry. Sudca sa pýta svedka: \r\n- Keď ste videli, že obžalovaný chce z piateho poschodia vyhodiť svoju svokru, prečo ste nezasiahli? \r\nSvedok: \r\n- Lebo som videl, pán sudca, že je dosť silný na to, aby to vybavil sám.', 266, 3.08, 45),
	(10226, 'Dvaja chlapi sa zhovárajú v krčme:\r\n- Predstav si, moja žena bola na operácii tváre a daroval som  jej kožu zo zadku.\r\n- To muselo bolieť.\r\n- To hej, ale keď vidím, ako ju svokra bozkáva na líce...', 209, 3.05, 45),
	(10227, 'Ako sa povie svokra po poľsky?\r\nBaba prebytočna!', 50, 3.15, 45),
	(10228, 'Dokedy sa na svokru pozeráte jedným okom?\r\nPokiaľ nestlačíte spúšť.', 75, 3.29, 45),
	(10229, '- Prečo si sa po rozvode oženil so sestrou svojej bývalej? \r\n- Aby som si nemusel zvykať na novú svokru.', 109, 3.14, 45),
	(10230, 'Ropucha a tridsať žabiek. Čo to znamená?\r\nSvokra vešia záclony.', 69, 3.25, 45),
	(10231, 'Prečo má svokra kruhy pod očami?\r\nLebo čert nikdy nespí.', 61, 3.52, 45),
	(10232, '- Koncom týždňa oslavujeme. Prídeš?\r\n- A čo oslavujete?\r\n- Bude svadba. Svokru si vzal Pán Boh!', 102, 3.08, 45),
	(10233, 'Rozprávajú sa dve svokry:\r\n- Vieš Marika, keď je vonku teplo, ja nenosím podprsenku.\r\n- No vidíš, a ja som stale rozmýšlala, čo ti to trčí z minisukne.', 163, 3.17, 45),
	(10234, 'Jaký je rozdíl mezi tchýní a miminem?\r\nŽádný, pochováš ji a máš klid.', 80, 2.88, 45),
	(10235, 'Ze kterých slov vzniklo slovo tchýně ?\r\nNo přece tchor + svině!', 68, 3.18, 45),
	(10236, 'Rozprávajú sa dvaja požiarníci:\r\n- Tak čo, ako stráviš veľkonočné sviatky? Čo si pripravuješ?\r\n- No čo... Manželku nechám tak a na svokru si požičiam vodné delo.', 179, 3.02, 45),
	(10237, '"Miláčik, čo darujeme mojej mame, tvojej svokre na narodeniny? Na Vianoce sme jej darovali kreslo. Čo by sa k tomu hodilo?"\r\n"Elektrický prúd!"\r\nHovorí na to muž.', 170, 3.18, 45),
	(10238, 'Chlapík na cintoríne uvidí druhého ako stojí nad hrobom a strašne sa rehoce. Prvý sa pýta:\r\n"Čo, žena?"\r\n"Nie svokra. Celý život nič nerobila, tak ju dám do presípacích hodín\r\na bude makať ako farebná."', 221, 2.99, 45),
	(10239, 'Stretnú sa dvaja kamaráti:\r\n- Na tejto slivke sa mi obesila svokra. - hovorí Jožo!\r\n- Jožo, daj štepa!', 108, 3.2, 45),
	(10240, 'Čo sú to zmiešané pocity?\r\nKeď sa svokra rúti z útesu v tvojom novom aute.', 81, 3.52, 45),
	(10241, 'Aký je rozdiel medzi svokrou a slnkom? Žiaden!\r\nNemôžem sa pozerať ani na jedno ani na druhé.', 99, 2.98, 45),
	(10242, 'V anglicku platí zákon, že si muži nesmú brať vlastné svokry.\r\nTypický príklad na nezmyselný zákon.', 110, 2.9, 45),
	(10243, 'Pýta sa sudca obžalovaného:\r\n- Prečo ste zhodili svoju svokru z balkóna?\r\n- Chcel som sa presvedčiť, či príšery vedia skutočne lietať!', 146, 2.91, 45),
	(10244, 'Na súde pri rozvodovom konaní za účasti svokry sa sudca pýta manžela prečo sa chce rozviesť. Manžel odpovedá:\r\n- Nevyhovuje mi! \r\nV tom svokra vyskočí a zvolá:\r\n- No to je dobré, všetkým vyhovuje, len jemu nie!', 226, 2.96, 45),
	(10245, 'Sudca sa pýta obžalovaného: \r\n- Tak tá pani, ktorú ste zhodili z okna, bola vaša svokra?\r\n- Áno, vaša ctihodnosť.\r\n- A nepomysleli ste na možnosť, že zraníte náhodného chodca?', 190, 3.39, 45),
	(10246, '- Kohn, kam cestujete?\r\n- Do Viedne.\r\n- A čo tam?\r\n- Ale, svokre na pohreb.\r\n- No, Viedeň je proste Viedeň...', 112, 3.05, 45),
	(10247, 'Príde chlapík do obchodu so zbraňami a kúpi si revolver. O deň sa vráti a pýta si späť peniaze. Predavač sa ho pýta, či je pokazený. On mu odpovie:\r\n- Nie, ale svokru prešlo včera auto.', 200, 3.27, 45),
	(10248, '- Počuj, to sa nehanbíš strielať po svokre a ešte sa pri tom smeješ?\r\n- Vtip je v tom, že ona nevie o tom, že sú slepé.', 129, 3.14, 45),
	(10249, '- Ty Fero, kam nesieš tie dve husi? \r\n- Svokra povedala, že by za jednu hus dala pol života. Tak jej nesiem dve.', 115, 2.92, 45),
	(10250, 'Ide pohrebný sprievod. Zastaví ich policajt:\r\n"Koho to pochovávate?"\r\n"Svokru."\r\n"A prečo truhlu nesiete nabok?"\r\n"Lebo na chrbte chrápe."', 143, 3.26, 45),
	(10251, 'Chlapík príde do obchodu so zbraňami a vraví:\r\n- Minuly týždeň som u vás kúpiš pištoľ. Môžem ju vrátiť? \r\n- Samozrejme, ale prečo? Nefunguje?\r\n- Ale nie, všetko je v najlepšom poriadku, ale svokru medzitým zrazil autobus.', 241, 2.95, 45),
	(10252, 'Polovník uvíta priateľov vo svojej chate a ukazuje im na stenách svoje trofeje - diviaka, srnca, jeleňa... Zrazu sa všetci zastavia pred skýmsi čudným ksichtom s podivným úsmevom. Všetci sa pýtajú:\r\n- A toto je čo?\r\n- Moja svokra. Do poslednej chvíle si myslela, že ju idem fotiť.', 298, 2.92, 45),
	(10253, 'Taussig jede v pohřebním průvodu, na chodníku stojí jeho přítel Lederer.\r\nLederer: "Manželka?"\r\nTaussig: "Tchýně."\r\nLederer: "Taky dobrý."', 149, 3.13, 45),
	(10254, '- Zlatko - hovorí manželka manželovi. Tá polievka sa mi nevydarila, hneváš sa?\r\n- Nie, vôbec sa nehnevám.\r\n- A prečo zlatko?\r\n- Lebo dnes príde tvoja mama.', 165, 2.96, 45),
	(10255, 'Príde svokra na návštevu a mladí sa jej nesmelo pýtajú:\r\n- A ako dlho ostaneš?\r\n- Ešte neviem.\r\nZať ale chce poznať presnejšiu odpoveď.\r\n- No, kým vám nezačnem prekážať - pokúša sa vtipne odpovedať svokra.\r\n- A to ani kávu nevypiješ?', 256, 3.79, 45),
	(10256, 'Aká vzdialenosť od svokry je najlepšia? \r\nAk je asi 1000 km ďaleko, ale najbezpečnejšia je ak je 2 m hlboko.', 114, 3.25, 45),
	(10257, 'Chlap drží svokru na 12 poschodí s okna a hovorí: \r\n- Iný by ťa zastrelil alebo utopil, ale vidíš jaký som ja dobrý, ja ťa pustím na slobodu.', 153, 3.23, 45),
	(10258, 'Zákazník v predajni: \r\n- Dobrý deň. Nemáte náhodou tesnenie na vodovod?\r\n- Nie, nemáme.\r\n- A nejaký iný kvalitný prsteň pre svokru nemáte?', 150, 3.27, 45),
	(10259, 'Viete čoho nie je nikdy dosť?\r\nBetónu svokre na hrob!', 56, 3.32, 45),
	(10260, 'Z okna na 8 poschodí visí žena a nejaký muž ju mláti po prstoch.\r\nOkoloidúci kričí:\r\n"Človeče, čo to robíte, veď spadne!"\r\n"To je moja svokra."\r\n"Ej, ale sa drží, potvora!"', 188, 3.41, 45),
	(10261, 'Jano príde k susedovi a hovorí:\r\n"Jožo, požičaj mi 10 vedier vody."\r\n"Načo ti budú, veď máš studňu?"\r\n"Ale vieš, padla mi do nej svokra a ešte jej z vody hlava trčí."', 181, 3.15, 45),
	(10262, '- Prídeš v piatok na oslavu?\r\n- A čo oslavujeme?\r\n- Ale vieš, svadbu.\r\n- Áno, a kto sa žení?\r\n- Ale nik známy. To si len Pán Boh v pondelok zobral moju svokru.', 168, 3.19, 45),
	(10263, 'Idú dvaja okolo jazera a jeden odhodí do jazera pištoľ.\r\n- Prečo si tu pištoľ odhodil?\r\n- Svokra včera dostala infarkt.', 127, 3.26, 45),
	(10264, 'Vraví kamarát kamarátovi na pohrebe:\r\n- Ako umrela tvoja svokra?\r\n- Otrávila sa hubami.\r\n- A ako to, že má rozbité zuby?\r\n- Bránila sa potvora. ', 152, 3.11, 45),
	(10265, '- Moja svokra jazdí ako blesk.\r\n- Tak rýchlo?\r\n- Nie, len každú chvíľu šlahne do nejakého stromu.', 105, 2.93, 45),
	(10266, 'Rádio Prachen: Chcel by som nechať zahrať pesničku svojej svokre, ktorá tragicky zhorela. Mohla by to byť pesnička od Pavla Vitka - Mám rád vôňu tvojej kože.', 169, 2.87, 45),
	(10267, 'Do obchodu so zbraňami vojde muž so žiadosťou, či môže vrátiť guľovnicu, ktorú si tu včera zakúpil.  Predavač sa ho pýta:\r\n- Čo, vari nefunguje?\r\n- Nie, všetko je v poriadku, len svokru medzitým prešlo auto.', 226, 3.15, 45),
	(10268, 'Stojí muž na desiatom poschodí a v rukách dolu hlavou drží svokru a kričí:\r\n- Vidíš, aký som ja dobrý. Druhý by ťa zabil alebo utopil, ale ja ťa pustím na slobodu!', 179, 3.25, 45),
	(10269, 'Je večer a vonku strašne prší. Ktosi klope na dvere. Mladý muž vstane od telky a otvorí. Vo dverách stojí jeho zmoknutá svokra. On jej hovorí: \r\n- Mamička, prečo stojíte za dverami v takomto počasí? Prečo radšej nejdete domov?', 244, 3.17, 45),
	(10270, 'Vletí muž do drogérie a kríčí: \r\n- Moju svokru dopichali včely! Celý roj! \r\n- Tu ale nemáme žiadne masti. \r\n- Čo blbnete, ja chcem len film do foťáka!', 163, 3.15, 45),
	(10271, 'Kamarát navštívil druhého a ten mu ukazuje na obrázkoch, čo všetko zastrelil: \r\n- Tu je tyger, lev, slon, zajac, svokra...\r\n- Svokra? A prečo sa tak usmieva? \r\n- Pretože som jej povedal, že sa ideme fotiť. ', 217, 3.01, 45),
	(10272, '- Počul som, že tvoja svokra dostala otravu krvi. Čo sa jej stalo?\r\n- Zahryzla si do jazyka!', 95, 3.16, 45),
	(10273, 'Viete, prečo sa svokry pochovávajú do pol pása?\r\nAby sa mal kto starať o hrob!', 83, 3.28, 45),
	(10274, 'Príde manžel z práce domov. Vojde do spálne, potme pomiluje ženu a ide sa najesť do kuchyne. Zrazu tam zbadá svoju ženu. Pýta sa jej, čo tam robí. Ona odpovedá, že čaká naňho s večerou.\r\n"A kto bol v spálni?", pýta sa muž.\r\n"Moja mama."\r\nManžel ide do spálne a vyčíta svokre, že prečo mu nič nepovedala. A ona odpovedá:\r\n"Veď mi sa spolu nebavíme."              ', 392, 3.86, 45),
	(10275, 'Jano, požičaj mi desať kýblov vody ! No a čo, ty nemáš vlastnú studňu? Mám, padla mi do nej svokra a vodu má iba po bradu!              ', 147, 3.5, 45),
	(10276, 'Anglický zákon zakazuje oženiť sa s vlastnou svokrou.\r\nTypický príklad úplne zbytočného zákona.              ', 119, 4.06, 45),
	(10277, 'Povie jeden muž druhému: \r\n"Moja svokra tá je anjel!" \r\n"To máš šťastie. Tá moja ešte žije."              ', 116, 3.38, 45),
	(10278, 'Jožovi zomrela svokra a tak ho manželka požiadala aby išiel podať smútočné oznámenie. Jožo hovorí obsluhujúcej: "Dobrý den, napište: Umrela svokra."\r\nObsluhujúca odpovie: "Pane, ale do 5 slov to máte za rovnakú cenu."\r\nJožo odpovedá: "Heeej? ta toto plati a dopiste: Predám staršiu škodovku."              ', 328, 3.71, 45),
	(10279, '- Pán Kremík, čože ste neboli na pohrebe svokry?\r\n- To viete, veľa práce a na zábavu čas nezostane...              ', 123, 3.95, 45),
	(10280, '- Jano, co sa stalo? \r\n- Ale, zomrela mi svokra.\r\n- A naco jej dávaš do truhly hasiaci prístroj?\r\n- Tej ježibabe sa v pekle zíde.              ', 148, 3.82, 45),
	(10281, 'Svokra poprosila zaťa, aby ju odviezol k lekárovi.\r\nDoktor ju prezrie a zať sa pýta:\r\n"Je nejaká nádej, pán doktor?!"\r\n"Bohužiaľ, je to len chrípka..."              ', 175, 3.93, 45),
	(10282, 'Moja svokra je aniel.\r\nTy sa máš moja este žije.              ', 65, 3.91, 45),
	(10283, 'Prišla svokra na návštevu \na zať sa jej pýta:\n"Mama, a dokedy tu budete?"\n"No, kým Vás nezunujem..."\nA zať nato:\n"Joj, mama, a to ani kávu nevypijete?"              ', 174, 3, 45),
	(10284, 'Chlap sedí v krčme a chľastá, doma jeho žena v kuchyni plače, lebo jej mama, jeho svokra, je na smrteľnej posteli a zomiera! Posiela syna po otca do krčmy. Chlap sa vráti a ona na neho spustí:\n"Že sa nehanbíš, ty hovädo, mama zomiera a ty v krčme chľastáš ako taký dobytok!"\nVtom on vyberie z chladničky fľašku, zo skrinky dva poháriky, naleje a ide k svokre do izby. Podáva svokre jeden pohárik a vraví:\n"No mamo, tak kapurková?!"              ', 472, 3.5, 45),
	(10285, 'Jano príde do spovednice a hovorí:\r\n-"Tá moja svokra stojí za hriech. A farár na to:\r\n-"Ale nie synak to predsa nemôžeš." \r\nJa viem otče nemôžem ju len tak zabiť!              ', 188, 3.85, 45),
	(10286, 'Svokra volá zaťovi: \r\n"Už si upiekol tú hus, čo som ti poslala?"\r\nMuž sa pozrie na ženu a hovorí: \r\n"Nie, ešte žije!"\n', 128, 3.86, 45),
	(10287, 'Lekár sa pýta pacienta:\r\n”Tak, pomohol vám ten liek?”\r\n”Áno, a keby ste vedeli ako... nech je svokre zem ľahká...”              ', 142, 3.63, 45),
	(10288, 'Slávnostne vyzdobený vianočný stromček, všade upratané, z kuchyne sa šíri vôňa štedrovečernej večere, skrátka vianočná pohoda. Na strope v obývačke je pribitá skoba a na nej visí staršia pani. Vo dverách stojí manželský pár v tichom zdesení. Ticho preruší manžel:\r\n”Teda, tá tvoja mama je ale formát! Krajší vianočný darček mi už ani nemohla dať...”              ', 407, 3.4, 45),
	(10289, 'Po ulici ide smútočný sprievod. Zrazu sa k trúchliacemu mužovi nakloní okoloidúci a pýta sa:\r\n”Manželka?”\r\n”Nie, svokra.” odpovie muž.\r\n”Tiež dobré.” povie okoloidúci.\n', 193, 4, 45),
	(10290, 'Karol doviezol večer Vlastičku pred barák, tá zosadne a hovorí mu:\r\n”Poď ešte hore na kávu...”\r\n”Dobre, ale skočím k tej káve ešte niečo kúpiť do drogérie.”              ', 194, 3.71, 45),
	(10291, 'Sťažuje sa manželka manželovi:\r\n”Drahý, vieš, čo som zistila? Ty nemáš rád nikoho z mojej rodiny.”\r\nManžel:\r\n”Ale to nie je vôbec pravda! Napríklad mám oveľa radšej tvoju svokru ako moju.”              ', 226, 3.92, 45),
	(10292, 'Koľko zubov má mať svokra?\r\nDva.\r\nJeden, aby mala s čím otvárať pivo a druhý, aby ju malo čo bolieť.              ', 124, 3.45, 45),
	(10293, '- Koncom týždňa oslavujeme, prídeš?\r\n- A čo? Nejaká svadba v rodine?\r\n- V podstate áno. Svokru si vzal PánBoh.              ', 133, 3.33, 45),
	(10294, 'Na pohrebe pozostalí na rakvu hádžu kvety, len svokra do hrobu hodí niečo, čo narazí na vieko. \r\n"No čo, kvety už nemali, tak som kúpila bonboniéru!"\n', 161, 3.56, 45),
	(10295, 'Svokra príde navštíviť zaťa:\r\n"Dobrý deň. Vitajte, poďte ďalej! Ako dlho sa zdržíte?"\r\n"Pokým ťa nebude moje prítomnosť unavovať."\r\n"Vy nezostanete ani na čaj?"\n', 178, 4.1, 45),
	(10296, 'Svokra ide na výlet a predtým sa zastaví u zaťa na kávu. Zrazu pozrie na hodiny:\r\n"To už sú tri? Tak to musím hneď vyraziť, inak mi ujde vlak."\r\nZačne sa obliekať, keď v tom z izby vyrazí synček a než stihne otec mrknúť hovorí:\r\n"Babi, nemusíš sa ponáhľať, ocko posunul hodiny o dve dopredu!"\n', 317, 3.67, 45),
	(10297, 'Čo je to? Cez deň to šteká a v noci to spí v krabici.\r\nSvokrina protéza.\n', 79, 3.71, 45),
	(10298, 'Príde muž domov z práce a pýta sa manželky: \r\n- Dnes tu bola na návšteve tvoja mama? \r\n- Áno, ako  to vieš? \r\n- No, lebo som opľutý na svadobnej fotke.\n', 163, 3.6, 45),
	(10299, 'Včera sme mali doma letecký deň. \r\nA prečo? \r\nAle, priletela k nám svokra.              ', 93, 4, 45),
	(10300, 'Nevesta dostala od matky krásnu nočnú košeľu. Po svadobnej noci sa jej matka pýta:\r\n- No, ako sa mu páčili lastovičky na tvojej nočnej košeli?\r\n- On si ich veľmi nevšímal. Išiel rovno do hniezda.\n', 211, 3.92, 45),
	(10301, 'Mladomanžel prichádza domov mierne podnapitý. Svokra stojí vo dverách s metlou v ruke. Hneď sa jej spýta: “Mamička, zametáte alebo odlietate?“              ', 169, 3.88, 45),
	(10302, 'Vbehne Fero do drogérie a kričí:\r\n- Moju svokru dopichali včely! Celý obrovský roj!!\r\n- Ale mi tu nepredávame žiadne antialergické prostriedky... - hovorí mu predavač.\r\n- Čo blbnete?! - čuduje sa Fero - Aké antialergické prostriedky?\r\nJa chcem iba film do foťáka...              ', 296, 3.86, 45),
	(10303, 'Kamarát navštívil druhého a ten mu ukazuje na obrázkoch, čo všetko zastrelil:\r\nTu je tiger, lev, slon, zajac, svokra...\r\nSvokra? A prečo sa tak usmieva?\r\nPretože som jej povedal, že sa ideme fotiť.              ', 222, 3.75, 45),
	(10304, 'Väzenský dozorca väznovi:\r\nMáte tu svokru, čo jej mám povedať?\r\nPovedzte, že nie som doma.\n', 99, 4.09, 45),
	(10305, 'Vracia sa bača z mesta a keď je už nedaľeko domu vidí, že sa začína búrka.\r\nKeď je 100 metrov od domu, udrie blesk a zabije všetky ovce. \r\nA bača: No toto!\r\nKeď je 50 metrov od domu udrie blesk a začne horieť dom. \r\nA bača: No toto!\r\nKeď je 20 metrov od domu vybehne z neho jeho svokra a v tom udrie blesk a zabije ju. \r\nA bača: No preto!              ', 370, 3.5, 45),
	(10306, 'Príde chlapík k lekárovi a ten mu hovorí: "Podla posledných výsledkov Vás môžem ubezpečiť, že\r\nrakovina to nie je a požijete si ešte dlho."\r\nChlapík celý natešený vybehne von kúpi si los a vyhrá milión.\r\nOd radosti volá žene a hovorí jej:\r\n"Rakovina to nie je a vyhral som milión."\r\nŽena mu hovorí:"Zomrela mi mama."\r\nChlapík zloží telefón mydlí si ruky a hovorí:"Ked to ide, tak to ide."              ', 435, 4, 45),
	(10307, 'Svokra má troch zaťov, preto chce vyskúšat ako ju majú radi.\r\nKeď je na dvore najstarší, skočí do studne a volá o pomoc.\r\nNajstarší zať ju vytiahne a na druhý den zbadá pred domom\r\nnovú škodu s nápisom "S vďakou svokra".\r\nĎalší deň opät skočí do studne a stredný zať ju tiež vytiahne.\r\nJeho odmenou je čisto nový Renault s nápisom "S vďakou svokra".\r\nNasledujúci deň tretí krát skočí, aby vyskúšala najmladšieho, no ten ju nevytiahne.\r\nĎalší deň stojí pred jeho domom BMW s nápisom "S vďakou svokor".\n', 551, 4, 45),
	(10308, 'Svokra sa rozhodne vyskúšať svojich dvoch zaťov. Príde k tomu bohatšiemu a na záhrade schválne spadne do bazénu. Zať pribehne a zachráni ju (čistenie bazénu od mŕtvol je drahé). Ráno sa zať prebudí a pred bránou stojí nová Octavia s nápisom "Díky, svokra". Svokra príde k druhému zaťovi, ten bazén nemá, ale býva pri rieke, tak do nej naschvál spadne. Zať sa pozerá, ako tá stará čarodejnica pláva s prúdom a je mu to úplne jedno. V noci rozmýšľa a hovorí si, aký je on somár, veď tiež mohol mať novú Octaviu. Ráno sa zobudí a pred domom stojí nový Mercedes s nápisom "Dík, svokor".              ', 650, 3.88, 45),
	(10309, 'Zazvoní zvonček,muž otvorí.Za dverami stojí svokra a pýta sa:-Môžem tu pár dní zostať?\r\n-Ale iste-odpovie muž a zatvorí dvere...', 141, 2.86, 45),
	(10310, '-Cez deň to šteká a v noci pláva. Čo je to?\r\n-???\r\n-Svokrine zuby!', 71, 3.46, 45),
	(10311, 'Ach tá moja svokra je ale anjel! Fúúha to máš dobré moja ešte žije!', 75, 3.19, 45),
	(10312, 'Pýta sa Jano Fera\r\n-"Prečo máš okrúhly dom?!?"\r\n-"Lebo svokra vravela, že keď postavím nový dom, tak že určite sa pri mne nájde nejaký ten kútik aj pre ňu..."', 173, 3.91, 45),
	(10313, 'Keď ťa pobozká svokra, mysli na to, že aj Kristus trpel!', 60, 3.38, 45),
	(10314, 'Jano, prečo má tvoja svokra také kruhy pod očami?\r\nPretože čert nikdy nespí!', 83, 3.36, 45),
	(10315, 'Pri spovedi sa chlap spovedá zo svojich hriechov:\r\n-Viete, tá moja svokra, to je ale ženská. Chvíľami premýšľam, že by stála za hriech.\r\n-Pamätaj, synu. Nezosmilníš!\r\n-Kdeže, pán farár, nezabiješ!', 214, 3.89, 45),
	(10316, '- Z ktorých slov vzniklo slovo tchýně? \r\n- No predsa tchor + svině!', 71, 4.04, 45),
	(10317, 'Príde manžel z práce domov, vojde do spálne, potme pomiluje ženu a ide sa najesť do kuchyne. Zrazu tam zbadá svoju ženu a spýta sa jej čo tam robí. Žena mu odpovedá, že na neho čaká s večerou.- A kto to bol v spálni? - pýta sa muž.- Moja mama. - odpovedá žena. Manžel ide do spálne a vyčíta svokre, že prečo mu nič nepovedala. A ona odpovedá - Veď my sa spolu nebavíme. ', 402, 3.6, 45),
	(10318, '- Viete čo nesie 40-ročný muž na kapote svojho auta?\r\n- Svokrinu mŕtvolu.', 78, 2.65, 45),
	(10319, 'Viete aká ja najlepšia vzdialenosť od svokry?2 km ďaleko, ale ešte lepšie 2 m pod zemou.', 94, 3.22, 45),
	(10320, 'Ako delíme svokry? Cirkulárom.', 32, 3.6, 45),
	(10321, 'Hľadá sa svokra. Kto ju nájde, dostane cez držku! ', 54, 3.97, 45),
	(10322, 'Príde chlap domov a pýta sa ženy: "Bola tu svokra?""Áno, ako vieš?""Lebo je opľutá svadobná fotografia."', 112, 4.03, 45),
	(10323, 'Aký je rozdiel medzi veveričkou a svokrou? Žiadny, obidve sú ryšavé svine!!! ', 83, 3.46, 45),
	(10324, '- Viete dokedy pozerá muž jedným okom na svoju svokru?\r\n- Dokiaľ nestlačí spúšť.', 89, 4, 45),
	(10325, 'Včera som bol zo svokrou v Zoo.\r\nNo a ako?\r\nNevzali ju.', 56, 3.65, 45),
	(10326, '- Aký je rozdiel medzi svokrou a sliepkou?\r\n- Sliepka hovorí pipipi a svokra nepi, nepi, nepi!', 96, 4, 45),
	(10327, 'Všade hrozne, u svokry najhoršie.', 35, 3.58, 45),
	(10328, 'Svokra chce vyskúšať lásku svojich troch zaťov k nej. Ide s prvým a nechtiac spadne do studne. Prvý zať neváha a zachráni ju. Ráno ho v garáži čaká nablýskaný Ford previazaný stuhou, na ktorej je nápis "Od svokry".Ide s druhým zaťom tiež okolo studne a nechtiac do nej spadne. Druhý zať ju zachráni a ráno ho v garáži čaká nablýskaný Fiat previazaný stuhou, na ktorej je nápis "Od svokry".S tretím zaťom ide opäť okolo studne a nechtiac do nej spadne, ale zať ju nezachráni. Ráno ho v garáži čaká nablýskaný Mercedes previazaný stuhou a s nápisom "Od svokra".  ', 610, 3.77, 45),
	(10329, 'Aký je rozdiel medzi palacinkou a svokrou?\rPalacinka je dobrá skrútená a teplá a svokra vystretá a studená.', 114, 3.4, 45),
	(10330, 'Muž sedí doma pri telke a popíja slivovicu. Príde domov manželka a vraví mu: "Mám pre teba jednu zlú a jednu dobrú správu..."\rMuž: "Tak vrav."\rŽena: "Zomrela mi mama."\rMuž: "A teraz tá zlá správa?"', 213, 4, 45),
	(10331, 'Kanadský hráč na pojednávaní IIHF o spornom momente:\r\n- Ja neviem čo sa stalo.  Ja som len korčuľoval okolo bránky a ich brankár sa mi napichol na hokejku.', 165, 3.17, 46),
	(10332, 'Aký je rozdiel medzi lavínovým a protidrogovým psom?\r\nLavínový hľadá lyžiarov a protidrogový snowbordistov.', 117, 3.14, 46),
	(10333, 'Sranda musí byť, povedali Česi a prehrali vyraďovací zápas s USA.', 71, 3.25, 46),
	(10334, 'Príde do baru futbalista s hokejistom. Sadnú si k baru a barman sa pýta, čo si dajú.\r\nHokejista:\r\n"Whisky s ľadom, prosím."\r\nFutbalista sa zamyslí a potom povie: \r\n"Aj mne jednu whisky ale s trávou."', 208, 3.44, 46),
	(10335, 'Sranda musí byť. Povedal Japonec a strelil si vlastný gól na MS v hokeji.', 77, 3.57, 46),
	(10336, 'Viete aký je to Slovenský trojboj?\r\n1. šprint do krčmy\r\n2. slovenská hádzaná v krčme\r\n3. orientačný beh domov', 119, 3.29, 46),
	(10337, 'Kúpim videonahrávku, kde naši hokejisti vyhrajú. \r\nZnačka: To sa často nevidí.', 85, 2.5, 46),
	(10338, 'Ako sa poviem po anglicky český hokejista?\r\nLucker!', 53, 3.54, 46),
	(10339, 'Milé rádio! Zahrajte, prosím vás, skladbu od NoName "Čím to je" pre našich hokejistov. Ďakujem.', 103, 3.48, 46),
	(10340, 'Kto sú najlepší slovenský brankári?\r\nNo predsa žŕdka a rozhodca!', 71, 3.28, 46),
	(10341, 'Totálny lyžiarsky začiatočník si zlomí nohu počas prvej jazdy na svahu. \r\n"Je to pokrok," - hovorí záchrancom - "vlani som si zlomil nohu už pri vystupovaní z vlaku."', 177, 3.24, 46),
	(10342, 'Boxer sa sťažuje u lekára, že nemôže spávať. \r\n"Radšej vam neodporučím žiadne lieky, aby ste si na ne nezvykli. Skúste to klasickou metódou. Počítajte ovce."\r\n"Skúšal som, ale nefunguje to. Vždy keď dôjdem k číslu 9 vyskočim na nohy a začnem poskakovať..."', 282, 3.09, 46),
	(10343, 'Tyson vyšiel z basy a nikto nechcel s ním boxovať. Manažér chodil po celom svete až nakoniec skončil na ďalekom východe v Stropkove. V miestnom boxérskom klube dohodol podmienky s manažérom a prišiel deň zápasu. Miestny  manažér hovorí pred zápasom v ringu Juskovi :\r\n- Jusku, kedz vytrimeš perše kolo, ta máš za to 1 milion USD.  Znáš keľo to peneži?\r\nJusko na to že zná a že vytrime. Po prvom kole príde manažér za Juskom a pri ovievaní mu hovorí:\r\n- Jusku, kedz vytrimeš aj druhé kolo, ta dostaneš 3 milióny USD. Znáš keľo to peneži?\r\nJusko na to že zná a že vytrime.  Jusko chudáčisko zbitý na mraky, ale vydržal aj druhé kolo.\r\nA manažér mu na to: \r\n- Jusku, kedz vytrimeš aj trece kolo, ta dostaneš 10 miliónou USD. Znáš keľo to peneži?\r\nA Jusko nato: \r\n- Dobre, vytrimem, ale potom mu už takú jednu vrazím.', 876, 3.6, 46),
	(10344, 'V januári 1999 sa uskutočnil Svetový pohár v zjazdovom lyžovaní.  Na treťom mieste skončil švéd, na druhom mieste nemec a na prvom mieste lavína.', 156, 3.14, 46),
	(10345, 'Televízia vysiela posledný rozhodujúci zápas futbalovej ligy. Hlava rodiny vzrušene pozerá na obrazovku, keď niekto zaklope. \r\n- Dovolíte, aby som u vás sledoval zápas? - pýta sa sused.\r\n- Pravdaže! Poďte ďalej. Pokazil sa vám televízor?\r\n- Ale kde! V našom byte vypukol požiar a od dymu som nič nevidel.', 323, 3.08, 46),
	(10346, 'Jeden pilot hovorí druhému:\r\n- Povedz parašutistom, aby prestali vyskakovať. Ešte sme nevzlietli!', 102, 3.01, 46),
	(10347, 'Na majstrovstvách sveta v zápasení vo voľnom štýle sa do finále prebojoval aj slovenský reprezentant. Jeho súperom bol Rus známy svojim chmatom "praclík", ktorého ešte nikto neporazil. Tréner radí Slovákovi:\r\n- Drž sa od neho, lebo keď ťa chytí do \'praclíka\' tak si v háji zelenom.\r\nHneď v prvom kole, po niekoľkých sekundách chytí Rus Slováka do "praclíka", všetci už vstávajú a tlieskajú, keď tu zrazu Slovák šmarí Rusa na zem, zvalí zo na lopatky a vyhráva zápas. Všetci sú prekvapení a on nechce povedať ako to dokázal. Tréner mu hovorí v kabíne:\r\n- Tak počúvaj, mohol by si mi to povedať, ako si ho dostal, som predsa tvoj tréner.\r\nOn mu hovorí:\r\n- O.K. Tak keď ma už chytil do toho \'praclíka\', vedel som, že nemám veľkú šancu, tak som sa začal obzerať. Tesne pred svojimi očami som videl gule. Tak som do nich z celej sily zahryzol a to by si sa divil akú silu človek vyvinie, keď sa zahryzne do vlastných gulí.', 987, 3.65, 46),
	(10348, 'Parašutista vyskočí z lietadla a po chvíli zistí, že sa mu nechce otvoriť padák. Zrazu vidí vedľa seba chlapa, tak sa ho pýta: \r\n- Tebe sa tiež neotvoril padák? \r\nA chlap mu odpovie: \r\n- Nie, ja som pyrotechnik.', 224, 3.07, 46),
	(10349, 'Telegram od Rusov:\r\nGratulujeme majstrom STOP ropa STOP plyn STOP', 65, 3.31, 46),
	(10350, 'Prečo v zápase Česko - Rusko bolo Jágra v 3. tretine tak málo vidieť na ľade? Pretože vybavoval spiatočné letenky domov. Naši ich strelili výhodne Čechom, teraz, keď ešte ostávajú...', 199, 3.1, 46),
	(10351, '- Ten Novák je vynikajúci! Predstav si, že bežal tisícpätstovku a potom skočil do diaľky viac než sedem metrov!\r\n- A čo? S takým rozbehom...', 151, 3.05, 46),
	(10352, '- Kde ste získali takú vytrvalosť, keď takmer netrénujete?\r\n- A čo to každodenné dobiehanie na električku?', 115, 3.01, 46),
	(10353, 'Po tréningu atlét vzrušene pribehne k svojmu trénerovi:\r\n- Podľa mojich hodiniek som prekonal svetový rekord! Koho mám vyhľadať?\r\n- Hodinára!', 151, 3.49, 46),
	(10354, 'Ľahkoatletický tréner vysvetľuje svojmu zverencovi:\r\n- Koľkokrát ti mám hovoriť, že tých šesťnásť metrov máš skákať na tri krát a nie naraz, pretože je to trojskok?!', 185, 3.38, 46),
	(10355, 'Diváci sledujú maratónsky beh:\r\n- Stavte sa, - hovorí pán Fialka svojmu známemu, - že vyhrá ten chlap s čerevnou kravatou!\r\n- S akou kravatou? To je jazyk!', 164, 2.78, 46),
	(10356, 'Je to žlté, má 24 nôh a 2 krídla, čo je to?\r\nJaponský futbalový team.', 77, 3.11, 46),
	(10357, 'Po prehratom zápase utešuje tréner boxera:\r\n- A vieš, že si ho v druhom kole poriadne vystrašil?\r\n- Naozaj???\r\n- Hej. Myslel si, že ťa zabil.', 149, 3.38, 46),
	(10358, 'Kurz lyžovania sa skladá z troch častí:\r\n1. Pripnúť si lyže.\r\n2. Spustiť sa zo svahu.\r\n3. Naučiť sa chodiť o barlách.', 129, 3.14, 46),
	(10359, 'Horolezec optimista a horolezec pesimista sa odtrhnú z útesu. Horolezec pesimista:\r\n- PADÁÁÁM! \r\nHorolezec optimista: \r\n- LETÍÍÍM!', 138, 3.59, 46),
	(10360, 'Slovenský hokejový brankári môžu vliesť bez obáv do každého bordelu. \r\nPrečo?\r\nLebo nechytia nič !!!', 111, 3.07, 46),
	(10361, 'Lyžovačka v Tatrách:\r\nPýta sa nýhodný zahraničný turista lanovkára:\r\n- Prečo stojí viac ľudí v rade pred bufetom ako v rade na lanovku?\r\n- Z bezpečnostných dôvodov. ', 181, 3.18, 46),
	(10363, '- Představ si, že naši fotbalisti dnes k  zápasu nastoupili v  řeznických zástěrách.\r\n- Rozumím, ten zápas byly asi pěkný jatka.\r\n- To ne, ale jdou od porážky k  porážce.', 187, 3.16, 46),
	(10364, 'Dva maníky zasype lavina. Přiběhne k nim záchranářský pes s rumem a jeden říká. \r\n"Hele nejlepší přítel člověka."\r\n"Jo a nese ho pes."', 150, 3.12, 46),
	(10365, 'Prebieha zoskok parašutistov. Ako prvý vyskočí nováčik, chvíľu voľne padá a potom otvorí padák. Vzápätí vídí okolo seba padať dvoch profíkov s ešte neotvorenými padákmi. Zamyslí sa, vyvlečie sa z padáka a hovorí si: \r\n"Keď chcete súťaž, budete ju mať!"', 283, 3.14, 46),
	(10366, 'Sestry Williamsové sedia v šatni pred začiatkom tenisového zápasu.\r\n- Myslím si, že náš otec nám dáva do jedla stereoidy - zašepká Serena.\r\n- Prečo si to myslíš? - pýta sa šokovaná Venus.\r\n- Vieš, začína mi rást ochplnenie na miestach, kde som ho predtým nikdy nemala.\r\n- Hrozné ... napríklad kde?\r\n- Napríklad na guliach!', 349, 3.35, 46),
	(10367, 'Komentátor v semifinálovom zápase Švédsko-Slovensko: \r\n- ... prihrávka na Štrbáka, Štrbák sa pripravuje na strelu... a góóóól!\r\n- Štrbák? To myslí toho obrancu, alebo sa vysmieva Bondrovi?', 205, 3, 46),
	(10368, 'Vieš, ako sa povie hokej po Fínsky?\r\n5:1 !', 44, 2.95, 46),
	(10369, 'Z letného tábora príde list:\r\n"Ahoj rodičia! Učili sme sa boxovať. Posielam vám zubnú kefku, pastu, strojček a iné zbytočnosti."', 139, 4.15, 46),
	(10370, 'Dvaja horolezci na zvislej stene. Horný hovorí dolnému:\r\n"Strašne sa mi chce čurať, čo mám robiť?"\r\n"Musíš vydržať, skús autosugesciu. Opakuj si, že sa ti nechce."\r\n"Nechce sa mi čúrať, nechce sa mi čúrať, nechce sa mi čúrať."\r\nPo chvíli sa ten spodný pridá:\r\n"Netečie na mňa, netečie na mňa."', 324, 3.62, 46),
	(10371, 'Dvaja parašutisti vo voľnom páde, držia sa za ruky. Jeden si dáva jablko, núka aj druhému. Keď dojedli, vytiahne ďalšie a zase ponúka. Stále vo voľnom páde. Pri treťom jablku ten druhý už nevydrží:\r\n"A kde berieš toľko jabĺk?"\r\n"Od teba. Máš ich na chrbte plný vak."', 291, 3.36, 46),
	(10372, '"Deti, prineste si zajtra na telocvik sánky a helmy."\r\n"Sánky, to je jasné. Ale prečo helmy?"\r\n"Lebo minulý rok pri sánkovaní jedny sánky narazili do stromu. Boli na nich dvaja chlapci, jeden bez helmy, ten bol na mieste mŕtvy, a druhý v helme, ten sa hneď postavil, otrepal sa, usmial a išiel domov."\r\n"Tak toho chlapca poznám! Dodnes sa usmieva, kade chodí, a občas sa otrasie."', 395, 3.02, 46),
	(10373, 'Ruský chlapík  je svetový preborník v zápasení. Každého zloží svojim super hmatom ktorý má názov "Praclík". Príde na Slovensko a postavia proti nemu slovenského borca. Na začiatku zápasu to je nerozhodne, potom sa pochytia, chvíľu sa naťahujú a nakoniec na úžas divákov rus vyletí z ringu. Po zápase je tlačova konferencia. Pýtaju sa Slováka ako to dokazál.\r\n"Chvíľu sme sa tak naťahovali, a zrazu zbadám pred sebou vajcia. Zahryznem sa do nich, a to by ste neverili koľko má človek sily, keď si zahryzne do vlastných vajec."', 565, 3.28, 46),
	(10374, 'Domáci tréner futbalového mužstva príde za svojimi zverencami do šatne a konštatuje:\r\n- Chlapci, nechcem byť poverčivý, ale za stavu 0:13 už začínam naozaj pochybovať o našom víťazstve.', 202, 3.33, 46),
	(10375, 'Vieš ako brzdia snowboardisti?\r\nPod svahom majú automaty na Sprite.', 69, 3.5, 46),
	(10376, 'V polčase futbalového zápasu vojde do kabíny rozhlasového reportéra tréner domáceho mužstva.\r\n"Počúvajte", prihovára sa reportérovi.\r\n"Nemohli by ste komentovať trochu pomalšie? Moji chlapci už nevládzu tak rýchlo behať!"', 240, 3.52, 46),
	(10377, 'Prečo bolo Fínsko na Majstrovstvách sveta v hokeji tretie?\r\nLebo Morava nepostavila národné mužstvo!', 106, 3.17, 46),
	(10378, 'Na tajnej schôdzi IIHF v Helsinkách sa stretli predstavitelia národných hokejových mužstiev Kanady, Fínska, Švédska, USA a Ruska. Po 4 hodinách vášnivej debaty o možných výsledkoch budúcoročných MS dospeli k záveru, že keď sa od Česka odtrhne aj Morava, tak je už aj bronz v prdeli.', 305, 3.13, 46),
	(10379, 'Aký je najpopulárnejší vodný šport?\r\nPotápanie iných.', 61, 3.14, 46),
	(10380, 'Na plavárni tam je hej, tam vám chodí kočka, aj tak som tam figu videl, štípali ma očká. ', 97, 3.28, 46),
	(10381, 'Rozprávajú sa dvaja arabskí šejkovia.\r\n- Nášmu Alimu sa zapáčili ženy športového typu. Zajtra sa žení s našim ženským basketbalovým tímom.', 156, 2.87, 46),
	(10382, 'Viete, čo je vrchol umenia?\r\nZviesť vlastného muža, keď je v televízii futbal.              ', 98, 4.04, 46),
	(10383, 'Viete, prečo nemôžu dobrí hokejoví brankári bezpečne chodiť po bordeloch?\r\nLebo tam všetko chytia.              ', 121, 4.07, 46),
	(10384, '"Oci, prečo všetci nadávajú tomu pánovi vedľa nás?"\r\n"Pretože hodil po rozhodcovi kameň."\r\n"Ale veď ho netrafil."\r\n"Veď práve preto!"              ', 159, 4.27, 46),
	(10385, 'Viete, čo je to totálna chudosť?\r\nKeď sa maratónec pretrhne na cieľovej páske!               ', 100, 3.83, 46),
	(10386, 'Na futbalovom štadióne:\r\n"Otecko, prečo všetci nadávajú tomu pánovi vedľa?"\r\n"Pretože hodil po rozhodcovi kameňom."\r\n"Dobre, ale veď ho netrafil?"\r\n"Práve preto!"              ', 188, 3.84, 46),
	(10387, 'Dvaja slovenský fanúšikovia po hokeji:\r\n- Paľo, nemôžem zaspať.\r\n- Tonko, počítaj slovenské góly!              ', 122, 3, 46),
	(10388, 'Po prehratom zápase utešuje tréner boxera:\r\n”A vieš, že si ho v druhom kole poriadne vystrašil?”\r\n”Naozaj???”\r\n”Hej. Myslel si, že ťa zabil.”              ', 175, 3.83, 46),
	(10389, '”Ja mám najtvrdšiu strelu z celého mužstva.” chváli sa v krčme futbalista.\r\n”Ja zasa pečeň.” tromfne ho spoluhráč.              ', 146, 3.54, 46),
	(10390, 'Dvaja rybári sa rozprávajú:\r\n”Včera som chytil dva metre dlhú šťuku!”\r\n”A ja som z vody vytiahol horiacu sviečku!”\r\n”Klameš, sviečka vo vode nehorí.”\r\n”Ty skráť šťuku, ja zhasnem sviečku!”              ', 234, 4.09, 46),
	(10391, 'Po prehratom zápase kričí tréner na hráčov:\r\n"Ja som vám povedal, aby ste hrali, ako nikdy predtým, nie akoby ste nikdy predtým nehrali!"              ', 160, 3.86, 46),
	(10392, 'Lyžovačka v Tatrách:\r\nPýta sa náhodný zahraničný turista lanovkára:\r\n”Prečo stojí viac ľudí v rade pred bufetom ako v rade na lanovku?”\r\n”Z bezpečnostných dôvodov.”              ', 202, 3.57, 46),
	(10393, 'Na plaveckých pretekoch sa rozprávajú dvaja diváci:\r\n”Ten náš reprezentant, čo vyhral, bol diskvalifikovaný! Použil netradičný štýl.”\r\n”Aký?”\r\n”Motorový čln!”              ', 200, 4.06, 46),
	(10394, 'Pred sezónou poskytuje tréner rozhovor:\r\n”V tejto sezóne sa nám darí. Ešte sme neprehrali ani jeden zápas.”\r\n”A koľký už hráte?”\r\n”Prvý.”              ', 175, 3.81, 46),
	(10395, '”Ako sa má váš pes?” pýta sa futbalista rozhodcu po zápase.\r\n”Aký pes? Ja žiadneho nemám!”\r\n”To je čudné, slepý ste a psa nemáte...”              ', 170, 4.14, 46),
	(10396, 'Tak, a potom, čo nás opustil v hre Milionár pán Ján so sumou päťdesiat tisíc Sk prichádzajú na rad rýchle prsty. Zoraďte nasledujúce hokejové družstvá podľa ich umiestnenia v základnej skupine na OH 2058. Začnite prvým:\r\na) Kamerun\r\nb) Slovensko\r\nc) Grónsko\r\nd) Taiwan              ', 303, 3.78, 46),
	(10397, 'Prebieha zoskok parašutistov. Ako prvý vyskočí nováčik, chvíľu voľne padá a potom otvorí padák. Vzápätí vidí okolo seba padať dvoch profíkov s ešte neotvorenými padákmi. Zamyslí sa, vyvlečie sa z padáka a hovorí si:\r\n”Keď chcete súťaž, budete ju mať!”              ', 299, 3.9, 46),
	(10398, 'Idú dvaja skialpinisti a zrazu jeden spadne do priepasti. Ten druhý sa nahne nad priepasť a volá:\r\n”Jano, si tam a žiješ?”\r\n”Som.”\r\n”A si celý?”\r\n”Som celý.”\r\n”A ruky aj nohy máš v poriadku?”\r\n”Hej mám!”\r\n”Aj chrbticu máš v poriadku, nemáš porušenú miechu?”\r\n”Nie nemám.”\r\n”No tak čo tam toľko robíš? Vylez von!”\r\n”Nemôžem! Ešte som nedopadol.”              ', 423, 4.26, 46),
	(10399, 'Milan sa chváli v krčme:\r\n”Tak, už som konečne aj ja začal športovať! Robím ľahkú atletiku - vrhám tieň!”              ', 135, 4.12, 46),
	(10400, 'Totálny lyžiarsky začiatočník si zlomí nohu počas prvej jazdy na svahu. \r\n”Je to pokrok,” hovorí záchrancom, ”vlani som si zlomil nohu už pri vystupovaní z vlaku.”              ', 196, 4.05, 46),
	(10401, 'Futbalista Jančula cestuje vlakom. Sprievodca sa ho pýta:\r\n- Budete prestupovať?\r\n- Nehovorte o tom nahlas, tréner ešte o tom nevie.              ', 151, 4.2, 46),
	(10402, 'Inzerát: Kúpim videonahrávky, kde naši hokejisti aspoň raz vyhrajú.\r\nZnačka: To sa často nevidí!              ', 119, 3.91, 46),
	(10403, 'Dvaja futbaloví fanúšikovia:\r\n"Predstav si, že keď som bol na zápase, začalo u nás horieť!"\r\n"To je strašné! Ako to skončilo?"\r\n"Našťastie dobre! Vyhrali sme!"\n', 174, 3.71, 46),
	(10404, 'Po hokejovom zápase:\r\n- Pán tréner, prečo ste dnes hrali tak katastrofálne?\r\n- Hm, neverili by ste, ako sa na tom ľade príšerne šmýka!               ', 159, 4.2, 46),
	(10405, 'Na futbalovom zápase kričí fanúšik na domáceho hráča:\r\n- Miro, hraj, alebo si kúp lístok!              ', 113, 3.9, 46),
	(10406, 'Slávny rečník číta na Olympijských hrách prejav: Ooóóó...\r\nKolega ho sprdne: O riadok nižšie, prosím. To boli Olympijské kruhy! ', 142, 3.88, 46),
	(10407, 'Ide Jánošík na bicykli, chytia ho pandúri a hovoria mu: Daj nám dušu, alebo dukáty!!! Jánošík na to: Prednú, alebo zadnú dušu?', 139, 3.95, 46),
	(10408, 'Po futbalovom zápase sa pýta hráč rozhodcu: "Ako sa má váš pes?"\r\nRozhodca:" Pes? Ja nemám žiadneho psa!"\r\nHráč: "No to je smutné, slepý, a nemá psa!"', 164, 3.34, 46),
	(10409, 'Viete aký je rozdiel medzi Slovanistom a Kosičanom? žiadny obi dvaja sú východňáry.\r\n', 92, 2.69, 46),
	(10410, 'Rusi hrali zápas s Čechmi, Česi vyhrali 4 : 0 a Rusi im poslali telegram: \r\n Hrali ste dobre STOP\r\n Nemali sme šancu STOP\r\n Ropa STOP \r\n Plyn STOP    \r\n', 156, 3.65, 46),
	(10411, '- Viete, kedy má hokejista šťastie?\r\n-Keď má po svojej kariére ešte všetky zuby.', 88, 3.92, 46),
	(10412, 'Na majstrovstvách sveta v zápasení vo voľnom štýle sa do finále prebojoval aj slovenský reprezentant. Jeho súperom bol Rus známy svojim chmatom "praclík", ktorého ešte nikto neporazil. Tréner radí Slovákovi:\r\n- Drž sa od neho, lebo keď ťa chytí do \'praclíka\' tak si v háji zelenom.\r\nHneď v prvom kole, po niekoľkých sekundách chytí Rus Slováka do "praclíka", všetci už vstávajú a tlieskajú, keď tu zrazu Slovák šmarí Rusa na zem, zvalí ho na lopatky a vyhráva zápas. Všetci sú prekvapení a on nechce povedať ako to dokázal. Tréner mu hovorí v kabíne:\r\n- Tak počúvaj, mohol by si mi to povedať, ako si ho dostal, som predsa tvoj tréner.\r\nOn mu hovorí:\r\n- OK. Tak, keď ma už chytil do toho \'praclíka\', vedel som, že nemám veľkú šancu, tak som sa začal obzerať. Tesne pred svojimi očami som videl gule. Tak som do nich z celej sily zahryzol a to by si sa divil akú silu človek vyvinie, keď sa zahryzne do vlastných gulí.', 987, 4.28, 46),
	(10413, '- Viete čo sa stane ak Slováci vyhrajú majstrovstvá vo futbale? \r\n- Vypnú playstation.', 91, 3.26, 46),
	(10414, '"Sranda musí byť", povedali Slováci a prehrali každý zápas.', 65, 3.71, 46),
	(10415, 'Sranda musí byť, povedali Česi a prehrali vyraďovací zápas s Japonskom.', 77, 3.57, 46),
	(10416, 'SPRÁVA: Po zápase na Majstrovstvách sveta v ľadovom hokeji sa mení predvoľba volania zo Slovenska do Českej republiky. Nová predvoľba je 08.', 149, 3.64, 46),
	(10417, 'Príhovor kapitánky ženského hokejového tímu v šatni:"Baby, cez play-off sa neholíme!!!"', 95, 3.75, 46),
	(10418, 'Jožo:Fero ideš si zakopať?\r\nFero:áno jasne.\r\nJožo:Tak tu máš motyku a ideme k nám na chalupu.', 101, 4.16, 46),
	(10419, 'Tréner hovorí v šatni svojim zverencom: "Ak som vám vravel, že máte hrať na jeden dotyk, nemyslel som tým, že sa máte dotknúť lopty len raz za polčas..."', 166, 3.68, 46),
	(10420, 'Francúzi upozornili na zle vymerané bránkoviská v Steel aréne. \rA reakcia jednej fanúšičky z východu. \r"Do Košičanoch nebudze nygdo rypac, šidzem centimetre francuzom vadzi, ale by šebe mali kupic mapu bo namišto do Košicoch ľeceli do Krakowa. Eščik raz šebe tote žabožrutske papuľe otvorja ta pojdu hrac na parkovisko pret štadion a nuka ich nepuscime ani s ľiskami."', 392, 4.22, 46),
	(10421, 'Čakal som a dočkal som sa,\r\nčakal som a vysral som sa!', 57, 2.73, 47),
	(10422, 'Je dôležité mať na vec vlastný názor, povedal pes a zakukal: \r\n"Kukuk - kukuk"', 84, 3.08, 47),
	(10423, 'Je to malé, čierne a ledva sa to udrží na nohách. Čo je to?\r\nMucha po fláme.', 83, 3.04, 47),
	(10424, 'Rozhovor dvoch chlapov:\r\n- Vrátil si mu ten nôž?\r\n- Áno!\r\n- A čo povedal?\r\n- Au!', 85, 3.33, 47),
	(10425, 'Sedem rokov som nepil, nefajčil, nebehal za ženami - hovorí Peter. A potom som začal chodiť do základnej školy.', 118, 3.48, 47),
	(10426, 'Ježko sa ožení s balónom. Príde svadobná noc, ježko sa pritúli k balónu a nežne zašepká:\r\n- Milujem ťa!\r\nBalón na to:\r\n- Pfffffff!', 144, 3.27, 47),
	(10427, '- Motýlik, motýlik, čo si to so mnou urobil, že som nedostala fotosyntézu?', 79, 3.23, 47),
	(10428, 'Ako uloviť krokodíla?\r\nNávod: Potrebujeme - stoličku, nudnú knižku, jednu koľajnicu, jablko, ďalekohľad, špendlík a zápalkovú škatuľu.\r\nPostup: Sadneme si na stoličku na brehu rieky, v ktorej je krokodíl. Začneme čítať nudnú knihu a zaspíme pri nej. Po chvíli z rieky vypláva krokodíl a kedže je zvedavý, začne čítať nudnú knižku a taktiež po chvíli zaspí aj on. My sme tú knihu začali čítať skôr a aj skôr sme zaspali, takže sa zobudíme skôr a začneme pred krokodílom utekať. On sa zobudí a začne nás naháňať. Je rýchlejší, takže odhodíme koľajnicu a neskôr aj jablko. Jablko nepadá ďaleko od stromu a tak vylezieme na ten strom. Keď už je krokodíl pod stromom, tak zoberieme ďalekohľad a pozeráme sa tak, aby bol krokodíl čo najmenší. Potom zoberieme špendlík, napichneme ho a uložíme do zápalkovej krabičky. A krokodíl je náš.', 913, 3.92, 47),
	(10429, 'Mrázik sa pýta: \r\n- Je ti zima, dievčatko?\r\nOna na to: \r\n- Čo ti šije hlupák starý, to je vibrátor.', 107, 3.41, 47),
	(10430, '- Prečo sa sprchuješ s dáždnikom?\r\n- Aby som sa nemusel utierať.', 69, 3.42, 47),
	(10431, 'Jedno veľmi škaredé dievča chce ísť na maškarný bál, ale nevie, za čo by mala ísť. Tak si len napchá tvaroh do  úst a ide. Na maškarnom bále sa jej pýtajú: \r\n- A ty si za čo?\r\nDievča si stisne líca a hovorí: \r\n- Ja som tu za jebák.', 254, 3.21, 47),
	(10432, 'Ženu zobudí podozrivý šramot na chodbe a rozsvietené svetlo. Ide teda skontrolovať, čo sa robí a čo nevidí.... príležitosť robí zlodeja.', 150, 2.91, 47),
	(10433, 'Učiteľka v osobitnej škole nakreslila na tabuľu kocku.\r\n- Detičky, čo je to?\r\n- Nevieeemeee.\r\n- Deti, toto je kocka. Zopakujte.\r\n- Kooockaaa.\r\n- Dobre. A prikreslila ešte jednu kocku. Deti a čo je toto?\r\n- Nevieeemeee.\r\n- Deti, to sú dve kocky. Zopakujte.\r\n- Dveee kooockyyy.\r\nUčiteľka po hodine príde na kávu do kabinetu a kolegyňa sa jej pýta: \r\n- Koľko kociek chceš do kávy?\r\n- Dvee kooockyyy. ', 415, 2.75, 47),
	(10434, 'Na hasičskej stanici:\r\n- Akcia bola úspešne ukončená. Požiar bol uhasený, nezhorela ani jedna krava. Desať sa utopilo.', 126, 3.32, 47),
	(10435, '- Spadol mi štipec.\r\n- Akej farby?\r\n- Drevenej.', 48, 2.84, 47),
	(10436, 'Ide chlapík po ulici a vidí ako ďalší umýva okno mokrou mačkou.\r\n- Hej, čo si zošalel? Surovec jeden! Vyžmýkaj tú mačku občas...', 142, 3.59, 47),
	(10437, 'VRCHOL GEOMETRIE:\r\nStáť v rohu okrúhlej miestnosti...', 56, 3.23, 47),
	(10438, '"Tá dnešná mládež je ale márnotratná", hovorí jedna spermia druhej, keď stekajú dole umývadlom.', 106, 3.52, 47),
	(10439, 'Dežo pečie hus. Zrazu sa otvorí trúba a hus mu hovori: \r\n"Dežo, prilož, lebo mám husiu kožu!!!"', 103, 3.16, 47),
	(10440, 'Môže dostať medveď jarnú únavu, ak spal celú zimu?\r\nAk si dal v septembri kávu.', 87, 2.87, 47),
	(10441, 'Paľo hovorí Dežovi:\r\n- Kúp si väčšie plavky, trčí ti z nich polovica vtáka.\r\nDežo urazene odpovedá:\r\n- Polovica? Celý!', 131, 3.57, 47),
	(10442, 'Keby nebolo vreckárov, ani by som si moc neužil...', 52, 2.85, 47),
	(10443, 'Čo je to totálne nič?\r\nOšúpaný balón.', 44, 3.11, 47),
	(10444, '"Sex, sex, sex inak umriem", povedala Pamela a umrela.', 54, 2.94, 47),
	(10445, 'Idú jednooký a slepý na diskotéku. Jednooký hovorí slepému:\r\n"Zober ma na ramená, a budem vidieť lepšie na cestu, lebo teraz ideme cez les."\r\nTak ho slepý nosí. No zrazu si jednooký vypichne oko na konári a hovorí: \r\n"Už sme došli...!"\r\nSlepý na to:\r\n"Čaute baby!"', 283, 3.61, 47),
	(10446, 'Ide ježko okolo močiara, hryzie si s chuťou do jablka a stretne bociana.\r\nBocian:- Čo ješ?\r\nJežko: - Čo bocian?\r\nBocian: - Čo ješ jež?\r\nJežko: - Čo bocian, bocian?', 175, 3.53, 47),
	(10447, 'Ide babka cez kolajnice a na zemi sa niečo leskne. Babka to zdvihne a to päťkoruna.\r\n"Ja mám teda štastný deň"\r\nTdn, tdn.\r\nTdn, tdn.', 139, 3.23, 47),
	(10448, 'Viete prečo sú chlapi lenivý?\r\nAj by som vám povedal , ale sa  mi nechce.', 77, 3.54, 47),
	(10449, 'Idu kombinačky na pivo a stretnú šrubovák. Šrubovák sa pýta:\r\n"Kde idete?"\r\nA kombinačky hovoria, že na pivo. \r\n"A možem ísť s vami?"\r\n"Hej."\r\nA idú kombinačky a šrubovák na pivo. Stretnú hasák. Hasák sa pýta: \r\n"Kde idete?"\r\n"Na pivo."\r\n"A možem isť s vami?"\r\n"Hej."\r\nA idú kombinačky, šrubovák a hasák na pivo. Idú, idú, idú, a pod autom leží kľúč 17, a pýta sa ich:\r\n"Kde idete?\r\n"Na pivo."\r\n"A možem ísť s vami?"\r\n"Nie. Až keď budeš mať 18."', 488, 3.25, 47),
	(10450, 'Jedzme trus!  Desať miliárd múch sa predsa nemôže mýliť.', 63, 3.16, 47),
	(10451, 'Všetci okolo sú blázni a zopár fajnoviek si hovorí lietadlo. Ale iba ja som ponorka!', 89, 2.94, 47),
	(10452, 'V televízii:\r\nHorolezec spadol z výšky 6000 m.n.m. do výšky 5000 m.n.m. Mal len dve modriny, ale 200 metrov od seba.', 121, 3.67, 47),
	(10453, 'Maximálne prekvapko pre deti?\r\nDeti čakali mikuláša a prišlo gestapo.', 74, 2.95, 47),
	(10454, 'Vojde bača do chalupy, zapne svetlo a chalupy nikde.', 53, 3.37, 47),
	(10455, 'Na maškarnom plese. K úplne nahej žene, ktorá je celá natretá na bielo, príde muž a pýta sa: \r\n- A vy ste aká maska? \r\nŽena roztiahne nohy a vraví: \r\n- Zubný kaz!', 175, 3.24, 47),
	(10456, 'Sprievodca vo vlaku príde do kupé a pýta lístky. Jeden cestujúci hovorí:\r\n- Ja nemám lístok.\r\nA sprievodca:\r\n- Ako to, že nemáte lístok? Čo tu vlastne robíte? Ako ste sa sem dostali?\r\n- No dovoľte! Vy ste na stanici vykrikovali NASTUPOVAŤ!', 254, 3.01, 47),
	(10457, 'Babka hovorí deťom: "Uhnite!!"\r\nA deti uhnili', 47, 3.41, 47),
	(10458, 'Janko, nebehaj stále dokolečka, lebo ti pribijem aj druhú nožičku.', 71, 3.52, 47),
	(10459, 'Viete prečo sa nevyrábajú čierne kondómy?\r\nPretože čierna zoštíhľuje.', 79, 3.31, 47),
	(10460, 'Dve piškóty idú po ceste. Jednu prejde auto a druhá hovorí:\r\n- Čo sa mrvíš?', 83, 3.39, 47),
	(10461, 'Je to hnedé a podobá sa to na psa.\r\nČo je to?\r\nNo predsa hnedý pes.', 71, 3.1, 47),
	(10462, 'Skotačia deti na mínovom poli, rozhadzujú ručičkami, nožičkami...', 72, 2.83, 47),
	(10463, 'Čtyři nesou rakev.Co je to?\r\nBylo nás pět.', 46, 3.15, 47),
	(10464, 'Ako indián zistí, že mu vyschlo jazero?\r\nZačne sa mu prášiť za kanoe.', 76, 2.94, 47),
	(10465, 'Letí sup nad pouští a kričí ORGAZMUS, ORGAZMUS.\r\nZnaš to? \r\nTy vole, je to děsne příjemnej pocit...', 108, 2.93, 47),
	(10466, '- Marka moja, ty si už ako tá Európska únia.\r\n- Prečo si to myslíš, Jožko?\r\n- Lebo aj ty sa len rozširuješ.', 117, 2.65, 47),
	(10467, 'Sú dve čierne ceruzky a jedna farebná. Tá farebná je tehotná. Od ktorej z tých dvoch asi?\r\nOd tej bez gumy.', 114, 3.27, 47),
	(10468, '- Ocko, čo to máš také chlpaté medzi nohami?\r\n- To nič Jurko, to je iba ježko.\r\n- Fíha, ten ježko má ale penis.', 121, 3.85, 47),
	(10469, 'Príde chlapík ku holičke, na hlave má tri vlasy a vraví:\r\n- Na Hasselhoffa ...\r\nHolička ho upravuje, ale vypadne mu jeden vlas. \r\n- Ale to vám už tak neočešem, vypadol vám vlas.\r\n- Tak na Elvisa ...\r\nVypadne mu ďalší.\r\n- To Vám už na Elvisa nespravím, ostal vám už len jeden vlas.\r\n- No nevadí, tak mi to nechajte rozpustené!', 346, 3.36, 47),
	(10470, 'Prečo je rieka plná vody\r\nAby sa neprášilo, keď lode budú brzdiť!', 72, 3, 47),
	(10471, 'Včera som ťa zúfale hľadala, chcela som ťa cítiť na svojom tele. Nakoniec som musela zaspať bez teba. Tak kde si ty posraté pyžamo?', 141, 3.15, 47),
	(10472, '- Jožko, prečo namáčaš tu stenu?\r\n- Lekár mi vravel, že si mám dávať obklady na miesta, kde som sa udrel.', 115, 3.15, 47),
	(10473, 'Viete, aká je to najväčšia tma? Keď musíte zapáliť druhú zápalku, aby ste zistili, či tá prvá ešte horí.', 119, 3.32, 47),
	(10474, 'Hygiena je nákazlivá a okrem toho požiera zdochliny...', 57, 2.9, 47),
	(10475, 'Gynekológ sa po 20 rokoch rozhodne, že toho už má dosť a rozhodne sa zmeniť povolanie. Náhodou nájde v novinách inzerát, že sa hľadá automechanik, tak že to skúsi. Na konkurze hovorí hlavný automechanik všetkým uchádzačom, že musia rozobrať a zložiť motor auta, za čo môžu dostať max 100 bodov. Gynekológ je za 5 minút hotový a hlavný mu hovorí. \r\n- Pána, chlape, tak ty dostaneš 150 bodov. \r\nGynekológ nechápe a pýta sa prečo. Hlavný mu na to: \r\n- Tak nie za to, že si všetko spravil za 5 minút, ale ešte k tomu si to spravil ce výfuk.', 582, 3.53, 47),
	(10476, 'Viete ako zabijete pštrosa?\r\nPostavíte ho na betón a postrašíte.', 69, 3.58, 47),
	(10477, 'Klop, klop...\r\n- Kto je tam?\r\n- Mama, ty sirota!', 48, 3.22, 47),
	(10478, 'Najlepší vtip je život ktorý žijeme.\r\nDeath', 48, 2.74, 47),
	(10479, 'Ide slepý a jednooký na motorke gratulovať babke k narodeninám. Idú cez les a jednooký si na konári vypichne oko a vraví:\r\n- No a sme došli.\r\nA slepý:\r\n- Všetko najlepšie milá babička.', 198, 3.4, 47),
	(10480, 'Viete kde nájdete korytnačku bez nôh?\r\nTam kde ste ju nechali.', 65, 3.27, 47),
	(10481, 'Čo urobí blondínka z dvomi železnými gulami?\r\nJednu stratí a druhú pokazí.', 82, 3.48, 47),
	(10482, 'Dežo chce spáchať samovraždu a preto vyskočí z okna z dvanásteho poschodia. Ako tak padá, počíta si poschodia, ktoré už "prešiel": \r\n- 12, 11, 10, 9, 8, 7, 8, 9, 10... dočerta, zasa tie traky!', 206, 3.26, 47),
	(10483, 'Prečo pije indián z bodkovanej šálky ?\r\nLebo je smädný?\r\nA prečo je z bodkovaného taniera?\r\nLebo má súpravu.', 118, 3.26, 47),
	(10484, 'Príde žaba s vrecom na hlave k doktorovi.\r\nTen sa pýta:\r\n"Čo vás bolí?"\r\nA ona na to:\r\n"Drž hubu, to je prepad."', 119, 3.32, 47),
	(10485, 'U ušneho lekara:\r\n"Čistím si uši klincom, a zrazu ticho!"', 61, 3.61, 47),
	(10486, 'Ležia na stole vedľa seba banán a vibrátor. Banán vraví vibrátoru:\r\n- Čo sa trasieš, ty somár, teba aj tak nezožerú.', 128, 3.52, 47),
	(10487, 'Učiteľ vyzval žiakov, aby napísali sloh, v ktorom by sa prekrývalo náboženstvo, modrá krv, sex a tajomno. Malý Juanito vzápätí zdvihol ruku, že má sloh hotový. Učiteľ sa začudoval: \r\n- Tak nám svoju prácu prečítaj.\r\nJuanito sa naklonil nad zošit: \r\n- Ó, bože, vykríkla kňažná, som tehotná, a neviem s kým.', 336, 4.04, 47),
	(10488, 'Ako som sa kúpal vo vani,\r\npriskákali ku mne klokany.\r\nNapriek tomu, že nemali dôvody,\r\nskočili mi všetky do vody.', 120, 2.54, 47),
	(10489, 'Koľko psychiatrov treba na výmenu žiarovky?\r\nJedného, ale žiarovka musí sama chcieť.', 91, 3.11, 47),
	(10490, 'Ide babka po chodníku a z tašky jej tečie mlieko.\r\nOproti nej ide ujko a hovorí:\r\n"Pani, tečie vám mlieko."\r\nA ona na to:\r\n"No a čo, ja mám doma gitaru."', 161, 2.86, 47),
	(10491, 'Vieš, prečo stvoril Boh mužom nohy do O?\r\nLebo všetko, čo sa mu nepáčilo dal do zátvorky.', 97, 3.12, 47),
	(10492, 'Príde žirafa do obchodu a hovorí:\r\n"Máte zelené rožky?"\r\n"Nie!"\r\n"To nevadí, ja som tu aj tak na bicykly."', 113, 3.21, 47),
	(10493, 'Som  v  tom.\r\nV  čom?\r\nV robote.', 33, 3.19, 47),
	(10494, '"Seděly tři na lavičce:Jedna hloupá, druhá škaredá,třetí taky učitelka."', 82, 3.29, 47),
	(10495, 'Mucha, kam letíš?\r\nNo a čo!', 30, 2.91, 47),
	(10496, 'Stojí Káčer Donald pri sporáku, v ruke drží zápalku a hovorí si: \r\n- Vybuchne? Nevybuchne?', 98, 3.22, 47),
	(10497, 'Pleso.\n\r\nKeď som vyšiel z lesa,\r\nspadol som do plesa.\r\nPleso bolo hlboké,\r\ntak som začal klesať.', 101, 2.56, 47),
	(10498, '- Prečo si celý mokrý, Janík?\r\n- Vieš, mamička, hrali sme sa na psov.\r\n- Nerozumiem.\r\n- No, ja som bol strom.', 115, 3.4, 47),
	(10499, 'Umrie terorista a príde pred nebeskú bránu pred Svätého Petra: \r\n- Nie, nie. Ty si veľa hrešil, teba nemôžem pustiť do neba. \r\nTerorista: \r\n- Veď ja tam ani nechcem ísť, ale vy máte tri minúty na evakuáciu.', 222, 3.63, 47),
	(10500, 'Ako sa robia debilne deti?\r\nSpýtaj sa otca!', 44, 3.35, 47),
	(10501, 'Pýta sa slepý bubeník hluchého gitaristu:\r\n- Už tancujú?\r\n- Prečo? Už hráme?', 85, 3.76, 47),
	(10502, 'Viete kto je to diplomat?\r\nTo je človek, ktorý vás pošle do zadku takým spôsobom, že sa na ten výlet celkom tešíte.', 125, 3.14, 47),
	(10503, 'V obci Horný Vadičov hlásia v rozhlase:\r\n- Majú k nám prísť mimozemšťania. Budú mali, zalení s vypleštenými očami. A musí sa s nimi pomaly hovoriť.\r\nJedného dňa orie Jano na poli. Zahľadí sa a v kríku uvidí niečo malé zelené s vypleštenými očami. Príde k tomu a pomaly hovorí:\r\n- Ja som Jano, ja tu oriem.\r\nTicho, nič sa neozýva. Tak to povie ešte pomalšie:\r\n- Ja som Jano, ja tu oriem.\r\nA z kríka sa mu ozve:\r\n- Ja som horár, je tu seriem.', 476, 3.67, 47),
	(10504, 'Viete prečo sa dáva pod Vianočný stromček papier?\r\nPreto, lebo ak by tam Ježiško nasral, aby sa to ľahšie upratalo.', 124, 2.94, 47),
	(10505, 'Prečo má nočník ucho?\r\nAby počul, keď sa čúra vedľa.', 61, 2.98, 47),
	(10506, 'Rozprávajú sa dve cibule a jedna hovorí druhej:\r\n- Fúj, ale ti smrdí z úst, čo si jedla cesnak?', 102, 2.97, 47),
	(10507, 'Čo má spoločne rýchlik s osobákom?\r\nKoľajnice.', 52, 3.29, 47),
	(10508, 'Koľko burských orieškov vojde do krabičky?\r\nBurské oriešky nechodia.', 74, 3.6, 47),
	(10509, 'Idem po ulici a počujem buchot treskot. Otočím sa a zistím, že ma bijú...', 79, 3.5, 47),
	(10510, 'Malé dievčatko vezme na ruku lienku a pýta sa:\r\n- Lienka, lienka, aké bude zajtra počasie?\r\n- Počuj, mladá! Čo som ti ja meteorologická stanica?!', 154, 3.34, 47),
	(10511, 'Pišta neskoro večer telefonuje kolegovi.\r\n- Preboha,Pišta čo chceš o pol jednej v noci ?\r\n- Ale som v bare a neviem sa rozhodnúť, mám už len 4 možnosti : buď si ešte objednám pivo, alebo vodku, alebo pôjdem domov a dostanem bitku od ženy , alebo ostanem späť niekde vonku.\r\n- Pišta, ale prečo s tým otravuješ práve mňa ?\r\n- Pretože som využil žolíka a volám známemu.', 395, 3.63, 47),
	(10512, 'Bič naháňa riť a riť sa schová na strome a premení sa na slávika. Bič ju zbadá a povie:\r\n"Slávik zaspievaj."\r\n"Ppppppppprrrrrrrrrrrrdddddddddddddd."', 159, 3.33, 47),
	(10513, 'Čo je lepšie? Flegmatizmus alebo nevedomosť?\r\n- Neviem a je mi to fuk!', 73, 3.16, 47),
	(10514, 'Aký je rozdiel medzi krokodýlom?\r\nŽe je dlhší než zelenší!', 66, 3.1, 47),
	(10515, 'Aký je rozdiel medzi vranou?\r\nŽe má obidve nohy rovnaké, hlavne tú pravú!', 79, 3.22, 47),
	(10516, 'Až mi bude tak 110, přijde Bůh a zmačkne RESET.', 51, 3.2, 47),
	(10517, 'Čo je to maximálna sila? \r\nKeď si na záchode tak prdneš, že to vytopí suseda!', 84, 3.19, 47),
	(10518, 'Je to zelené, chlpaté, má to štyri nohy a keď to na teba spadne, tak ťa to zabije. Čo je to? \r\nGulečníkový stôl.', 123, 3.49, 47),
	(10519, '- Koľko je hodín?\r\n- Ráno bolo sedem, vypočítaj si.', 56, 3.85, 47),
	(10520, '- Mami, poďme aj mi piknikovať!\r\n- Ale Ivko, to sú bezdomovci.', 65, 3.37, 47),
	(10521, 'Viete prečo má slon chobot ?\r\nNo, aby sa nezačínal tak naraz...', 67, 3.18, 47),
	(10522, 'Šli dva a prostřední upad.', 29, 3.28, 47),
	(10523, 'Dva psy sa hrajú na útulok.', 29, 3, 47),
	(10524, 'Prečo je v ZOO lev v klietke?\r\nNo keby bol v akváriu, asi by sa utopil.', 73, 3.22, 47),
	(10525, 'Ide Európan na ťave po púšti a okolo neho prefrčí veľkou rýchlosťou Arab na svojej ťave. Keď sa neskôr stetnú v oáze Európan sa pýta Araba, že prečo tak rýchlo jazdí na tej ťave? Arab mu odpvedá, že preto aby mu bolo chladnejšie. Keď vyjde Európan z oázi ženie ťavu koľko vládze. Po niekoľkých kilomertoch ťava odpadne. Európan chodí okolo nej, po chvíli do nej kopne a hovorí: \r\n"Hlúpa zamrzla!"', 435, 3.15, 47),
	(10526, 'Išli dvaja medvedi. Jeden hnedý a druhý do prava.', 52, 3.1, 47),
	(10527, 'Zajíc uvidí orla a ptá se:\r\n"Orle kam letíš?"\r\n"No a?"', 59, 2.83, 47),
	(10528, '- To je ale riadne škaredá nevesta.\r\n- No dovoľte, to je moja dcéra!\r\n- Prepáčte, nevedel som, že ste jej otec.\r\n- No dovoľte, ja som jej matka!', 152, 2.92, 47),
	(10529, 'Maroško vola do rádia:\r\n- Dnes ráno som našiel peňaženku a bolo v nej 1000 dolárov, 4000 mariek a 30000 korún. Bola tu aj adresa: Peter Novák, Vajnorská 12, Bratislava. Prosím vás, zahrajte mu nejakú peknú pesničku. ', 231, 3.41, 47),
	(10530, 'Prečo je netopier v mikrovlnke? \r\nPočúva hudbu.', 50, 3.07, 47),
	(10531, 'Príde čas žatvy, Jano zoberie kombajn, vyjde do poľa, pozerá, pozerá, zrazu sa buchne po celé a hovorí:\r\n- Doboha! Veď ja som zabudol zasiať!', 151, 3.03, 47),
	(10532, 'Viete kedy zistíte, že starnete?\r\nKeď pojete viac tabletiek ako vaša vnučka na diskotéke!', 95, 3.24, 47),
	(10533, 'Stretnú sa dvaja kriví a jeden hovorí tomu druhému:\r\n"Ty Ďuro požičaj mi 1000 korún, zajtra sa vyrovnáme ?"', 116, 3.36, 47),
	(10534, 'Tri kamienky sa hrali na štrk.', 31, 3.35, 47),
	(10535, 'Kto sa bojí tmy nech nejde do KENE!', 36, 2.79, 47),
	(10536, 'Jednooký a slepý idú s motorkou na diskotéku. Idú cez les a jednooký si na konári vypichne aj  druhé oko. Vraví :\r\n- No , a sme došli!\r\nA slepý na to:\r\n- Čaute baby!', 177, 3.29, 47),
	(10537, '- Dežo, pod skratkou!\r\n- Nie!\r\n- Prečo?\r\n- Ponáhľam sa!', 59, 2.89, 47),
	(10538, 'Rozprávajú sa dvaja:\r\n- Založili sme kvarteto!\r\n- Kto?\r\n- No my traja.\r\n- Kto my traja?\r\n- No ja s bratom!\r\n- Ty máš brata?\r\n- Nie. Prečo?', 144, 3.1, 47),
	(10539, 'Sprievodca vo vlaku vraví pánovi:\r\n- Pane, prosím vás, nenakláňajte sa z toho okna, je to nebezpečné.\r\n- Nebojte sa, chodím týmto vlakom do práce už 5 rokov a dobre viem, že teraz prídu tri be-be-be-tonové stĺpy.', 228, 3.45, 47),
	(10540, 'Výjdu dve kostry z hrobu a jedna si zoberie náhrobný kameň. Druhá sa jej pýta:\r\n- Načo ti to je?\r\n- Musím mať predsa doklady.', 134, 3.6, 47),
	(10541, 'Čo je najväčšia haluz na svete?\r\nKeď Bočeli uvidí utekať Gombitovú!', 76, 2.62, 47),
	(10542, 'Idú dve piškóty po ceste a jednu zrazí auto. Druhá jej na to hovorí:\r\n- Čo sa tu mrvíš?', 96, 3.58, 47),
	(10543, 'Nebojte sa, podržíme vás. Keď nie, spadneme s vami. \r\nVaše Aerolínie.', 75, 3.23, 47),
	(10544, 'Kolumbus sa plaví aj so svojimi námorníkmi po Atlantiku. Po mnohých dňoch jeden z nich zvolá:\r\n- Zem, vidím zem.\r\nRýchlo pribehne Kolumbus, schmatne ďalekohľad a po chvíli hovorí:\r\n- To je nič, to je Kuba, ideme ďalej.', 232, 3.12, 47),
	(10545, 'Ja som malý mravcek,\r\nvyleziem si na kopcek.\r\nTo som rad, to som rad,\r\nže sa mozem vyčúrať.', 96, 2.99, 47),
	(10546, '- Žaba, prečo si zelená?\r\n- Lebo jem hašlerky.', 50, 3.57, 47),
	(10547, 'Ježko, ježko kam ideš?\r\nJežko na to:\r\n"No a čo, že mám pichliače?!"', 75, 2.82, 47),
	(10548, '- Slečna, aký máte dnes večer program?\r\n- Úplne iný ako vy!', 65, 3.18, 47),
	(10549, 'Rozprávajú sa dva slepé kone.\r\n- Počuj, nepôjdeme tento rok súťažiť na Veľkú Pardubickú?\r\n- Nevidím v tom prekážky...', 132, 3.98, 47),
	(10550, 'Ako zistíte, že vás ľudia totálne ignorujú?\r\nIdete po chodníku a oproti Vám idú Jehovisti.Hneď ako Vás zbadajú prejdú na druhú stranu.', 148, 3.17, 47),
	(10551, '"Tak čo?"\r\n"Tak nič."\r\n"Tak ZLEZ !"', 37, 3.02, 47),
	(10552, 'Klop, klop.\r\n"Kto je tam?"\r\n" Ja!"\r\n" Ja?"', 42, 3.2, 47),
	(10553, 'Viete, čo sú to dve drevené dosky a tri klince 12-ky?\r\nOddychová súprava typu Ježiš.', 91, 2.82, 47),
	(10554, 'Príde kostra do baru, buchne po stole a hovorí:\r\n"Jedno pivo a handru!"', 73, 4.08, 47),
	(10555, 'Ide babka v autobuse a makový rožok.', 38, 3, 47),
	(10556, 'Dedko vraví svojej vnučke: \r\n- Anička, daj si zmrzlinu.\r\nAnička vystrašene vykríkne: \r\n- Kam?', 99, 3.17, 47),
	(10557, 'Príde rozveselený hosť do reštaurácie a čašník sa ho zdvorilo opýta:\r\n- Vaše prianie?\r\nHosť:\r\n- Všetko najlepšie.', 126, 3.06, 47),
	(10558, '- Už ste všetci nastúpili? - pýta sa cestujúcich vodič autobusu.\r\n- Áno!\r\n- Tak hneď aj vystúpte, autobus horí!', 121, 3.4, 47),
	(10559, 'Prechladne žirafa, keď stojí v studenej vode?\r\nÁno, ale až po týždni!', 76, 2.96, 47),
	(10560, 'Ide chlapík po ulici a vykrikuje: \r\n- Menštruácia, menštruácia. \r\nZastaví sa pri ňom druhý a ten mu hovorí: \r\n- Ale ujo, aká menštruácia, veď to je demonštrácia. \r\n- To je jedno, aj tak potečie krv.', 214, 3.26, 47),
	(10561, 'Ako zomrel slimák?\r\nPozrel sa do zásuvky.', 43, 3.2, 47),
	(10562, 'Muž beží za autobusom a kričí:\r\n- Počkajte, prosím počkajte!\r\nAutobus zastane. Muž nastúpi a povie:\r\n- Lístky prosím.', 129, 2.87, 47),
	(10563, 'Búcha to hlavou o stôl a nevie sa to posadiť. Čo je to?\r\nStôlobuch neposedný.', 83, 2.64, 47),
	(10564, '- Vieš, aký je rozdiel medzi klavírom a buldozérom?\r\n- Neviem.\r\n- Tak budeš mať veľký problém, keď budeš kupovať klavír.', 133, 3.05, 47),
	(10565, 'Prečo má veverička chvost vzadu?\r\nLebo veverička je vpredu!', 63, 3.07, 47),
	(10566, 'Prečo hovoria ľuďom pri pochovávaní "nech ti je zem ľahká", keď potom na nich šlahnú dvestokilový náhrobný kameň?', 127, 2.89, 47),
	(10567, 'Idú dvaja po púšti. Jeden má veľa jedla a pitia a druhý má dvere z auta. Druhý sa pýta prvého:\r\n- Prečo máš toľko jedla a pitia?\r\n- No, keď budem hladný sa najem a keď budem smädný sa napijem.\r\nTeraz sa pýta prvý druhého:\r\n- A načo sú tebe tie dvere z auta?\r\n- No, keď mi bude teplo, otvorím si okno.', 326, 3.1, 47),
	(10568, 'Viete čo dokáže najviac vytočiť austrálskeho domorodca? \r\nKeď si kúpi nový bumerang a ani zasvet nemôže zahodiť ten starý!', 135, 3.1, 47),
	(10569, 'Stretne sa Archimedes a Pytagoras v krčme, strašne sa ožerú a vznikne z toho zákon:\r\nTeleso ponorené do kvapaliny ani Boh nevytlačí na preponu pravoúhleho trojuholníka.', 178, 3.27, 47),
	(10570, 'Juro Jánošík vojde do svojej krčmičky v Terchovej a dá si naliať päť pohárikov obľúbenej slivovičky. Zrazu zbadá, že okolo krčmy je plno drábov. Postaví sa a chystá sa utiecť.\r\nVtom sa spoza pece postaví stará babizňa aby nasypala hrach pod nohy nášmu Jánošíkovi. Ten sa pozrie na babizňu a zvolá:\r\n- Ha-ha-ha, už ma nedostaneš, kúpil som si tretry!', 382, 2.85, 47),
	(10571, 'Telefonický rozhovor: \r\n"Prosím ?"\r\n"Je tam ŠTB ?"\r\n"Nie, tu je ŠBTD."\r\n"A čo to znamená ?"\r\n"Štátny byt, Ty debil."', 124, 3.1, 47),
	(10572, 'Ide bocian po jazere, stretne žabu a spýta sa jej:\r\n- Žaba, čo si taká čierna?\r\n- Zjedla som hašlerku.', 109, 2.9, 47),
	(10573, 'Verš na Vianočný večer bezdomovca: \r\nSniežik sa nám chumelí, jedlo sa už zjedlo. \r\nSniežik sa nám chumelí, Santovi zas jeblo.', 136, 3, 47),
	(10574, 'Slimák ide cez zimu po lese a natrafí na medvediu jamu. Zaklope a otvorí mu medveď. Medveď sa opýta:\r\n- Kto ma vyrušuje? \r\nSlimák: \r\n- Nemáš trochu vody? \r\nMedveď ho odkopne. O 2 týždne sa slimák vráti a medveď otvorí dvere.\r\nSlimák: \r\n- A to čo malo znamenať?!', 281, 3.11, 47),
	(10575, 'Janko,Jožko a Dežko sa pretekajú kdo je odvážnejší.Dohodli sa, že skúška odvahy bude mať dve časti,najprv musia podať ruku medvedici a potom sa vyspať so svojou ženou. 1. ide Janko,vybehne do jaskyne za medveďom, a keď sa vráti je taký otrasený, že už nieje ničoho schopný.\r\n2. ide Jožko a dopadne rovnako ako Janko.3. ide Dežko,Janko a Jožko čakajú, čakajú a Dežka nikde.Po pol hodine vybehne aj on.\r\n"Čo si tam  tak dlho robil ?"\r\n"Bola tam strašná  tma a s kým si to mám vlastne podať ruku?"', 532, 3.05, 47),
	(10576, '- Prečo za sebou ťaháš tú šnúrku?\r\n- A čo ju mám tlačiť?', 67, 3.13, 47),
	(10577, 'Je to farebné a je to pod zemou, čo je to?\r\nZakopané lentilky.', 65, 2.72, 47),
	(10578, 'Je to žlté a nenatiera sa to na chlieb. Čo je to?\r\nBáger.', 61, 3.09, 47),
	(10579, 'Ide ponorka po púšti, vypadne z nej ladnička, líška sa opýta koľko je hodín, lastovička vytiahne teplomer, povie ,že je štvrtok, medveď povie ďakujem nefajčím, nasadne na kolobežku a odíde vlakom.', 213, 2.78, 47),
	(10580, 'Krtko kam ideš?\r\nNo a čo že som čierny.', 43, 3.09, 47),
	(10581, 'Viete čo je to absolútna odvaha?\r\nUtrieť si riť sklenou vatou.', 66, 3.95, 47),
	(10582, 'Ste stredoveký rytier a stretnete unudeného draka. Ponúkne vám partičku dámy. Ak vyhráte zožerie vás, ak prehraté zožerie vás. Aké ponaučenie z toho vyplýva? Nelezte do stredoveku a nehrajte dámu s drakmi.', 221, 2.56, 47),
	(10583, 'Hypnotizér a telepat si chcú odskúšať, kto z nich má lepšie schopnosti, preto uzavrú stávku.\r\nHypnotizér hovorí: \r\n- Vidíš  tú krásnu ženu na ulici ? Stav sa, že o päť minút sa vyzlečie do naha!\r\nHypnotizér sa sústredí, zavrie oči a žena sa naozaj o 5 minút začne vyzliekať.\r\n- Teraz som na rade ja. Vidíš ten balkón na vrchole tohoto mrakodrapu? Do piatich minút vyjde niekto na balkón a vyhodí z neho televízor.\r\nTelepat sa sústredí, prejde päť minút, nič sa nedeje. Prejde 10 minút, stále nič. Pätnásť minút - na balkóne ani noha. Po dvadsiatich minútach hlbokého sústredenia zrazu niekto vybehne na balkón a z celej sily nervózne zreve:\r\n- Ale ja nemám televízor!', 724, 3.41, 47),
	(10584, 'Když jsem byl v pubertě, tak abych přestal masturbovat, dával mi otec do čaje jistou věc. Můj penis.', 107, 3.03, 47),
	(10585, '- Dobrý večer. Kam tak zrána? Na obed, na obed?', 50, 2.77, 47),
	(10586, '- Čo ti je, trápi ťa niečo?\r\n- Nič mi nie je.\r\n- Raňajkoval si?\r\n- Áno, ešte včera.', 92, 2.87, 47),
	(10587, 'Na obrovskej zaoceánskej lodi si kapitán zvolá všetkých na palubu a hovorí:\r\n- Mám pre vás dve správy. Jednu dobrú a jednu zlú. Tak ktorú chcete počuť najskôr?\r\n- Tu dobrú!\r\n- Dostaneme jedenásť oskarov.', 221, 2.94, 47),
	(10588, 'U mäsiara:\r\n- Máte niečo čerstvo zarezaného?\r\n- Áno, gaťky v zadku!', 74, 3.1, 47),
	(10589, 'Viete aký je rozdiel medzi vagónom a pomarančom?\r\nŽiadny. Ani jeden nemá zips.', 83, 3.03, 47),
	(10590, '- Máš niečo proti moliam?\r\n- Nie, ale ani s nimi nesympatizujem!', 67, 2.95, 47),
	(10591, 'Idú dve kostry na motorke a jedna z nich si za sebou ťahá náhrobný kameň. Kameň strašne búcha, iskrí, vlastného slova si nepočuť. Až to napokon tú druhú kostru naštve a pýta sa:\r\n"Počúvaj, na kerú Máriu si ťaháš ten náhrobný kameň?"\r\nA tá druhá jej na to:\r\n"Šak musím mať zo sebou dáke doklady, nie?!"', 335, 3.06, 47),
	(10592, 'Sedia dvaja škriatkovia na žiletke, príde tretí a hovorí:\r\n"Posuňte sa."', 78, 3.29, 47),
	(10593, '- Ešte pred chvíľou som tu mal salámu a už je v riti.\r\n- Človeče, ty máš ale trávenie.', 96, 3.62, 47),
	(10594, 'Kostra išla ku kožnému...', 28, 2.78, 47),
	(10595, 'Stretli sa 2 babky a 3.hovorí:\r\n"Z nás štyroch bude pekná pätica."', 71, 3.09, 47),
	(10596, 'Aký je rozdiel medzi ruským a slovenským divadlom?\r\nU nás uspávajú obecenstvo herci a v Rusku plyn.', 105, 3.1, 47),
	(10597, 'Ide babka po púšti a spadne na ňu balkón.', 45, 2.56, 47),
	(10598, 'Viete prečo majú teplí stále šťastie?\r\nLebo sa im šťastie bojí otočiť zadkom.', 88, 4.21, 47),
	(10599, 'Príde budík skôr z roboty a nájde pani budíkovú s iným budíkom v posteli. Ruzčúli sa a hovorí:\r\n"Tak ty tak tyk tak tyk tak!"', 136, 3.32, 47),
	(10600, 'Ide Fero po ulici, lebo vonku je škaredo. Nevadí aj tak má krátke vlasy. Potom išiel do konára, lebo vonku bolo pekne.', 124, 2.02, 47),
	(10601, 'Idú dvaja ľudožrúti po púšti. Zbadajú kostru a ten jeden hovorí:\r\n" Aha chrumky!"', 89, 3.64, 47),
	(10602, 'Ide dedko večer domov cez les. Ako vojde do lesa, uvidi veľkú tabuľu. Na nej je napísané: \r\n"Pozor buzerant!" \r\nPovie si, že čo by tu robil tak neskoro večer a išiel ďalej. Tam uvidel menšiu tabuľu, na ktorej bolo napísané to isté. Takto sa to opakuje, až po koniec lesa, kde je úplne maličká tabuľa. Načiahne sa, aby ju prečítal a buzerant priskočí a povie:\r\n"Tak tu ma máš!"', 404, 2.9, 47),
	(10603, 'Prečo nemôže slimák jazdiť na bycikly?\r\nLebo by mu trepotali oči.', 71, 2.97, 47),
	(10604, 'Stretnú sa dvaja a jeden hovorí: \r\n"Povedz mi číslo a ja ti poviem rím."\r\n"Napríklad tri." \r\n"Riť si vytri."\r\n"A teraz ty." \r\n"Päť." \r\n"Riť si vytri a dve ti zostanú!"', 178, 3.19, 47),
	(10605, 'Tlačí chlapík káru popri vlaku a kričí:\r\n- Langoše, čerstvé langoše. \r\nZrazu sa niekto vykloní z vlaku a pozvracia mu ich. Chlapík kričí:\r\n- Pizza, pizza.', 168, 3.79, 47),
	(10606, 'Je to oranžové, guľaté a začína to na P. Čo je to?\r\nPomaranč.\r\nJe to oranžové, guľaté a začína to na N. Čo je to?\r\nNeuveriteľné, zasa pomaranč!', 161, 2.99, 47),
	(10607, 'Je to na strome a nedýcha to. Čo je to?\r\nVrana v sáčku.', 59, 3.14, 47),
	(10608, 'Príde kostra k doktorovi a doktor na to:\r\n"Hm, no skoro idete, fakt skoro..."', 78, 3.28, 47),
	(10609, 'Dedko sa rozložil na gauči...', 31, 2.67, 47),
	(10610, 'Viete prečo babka vylieva 4 litre mlieka do kanálu?\r\nLebo má novú elektrickú gitaru!', 89, 2.68, 47),
	(10611, 'Pride starý dedo na vlakovú stanicu. Predavačka sa ho pýta:\r\n"A kam to bude, dedo?"\r\n"Tam a nazad."', 103, 3.36, 47),
	(10612, 'Viete, prečo má slon také veľké uši?\r\nAby mohol skákať z kvietka na kvietok.', 84, 3.26, 47),
	(10613, 'Čo treba urobiť, ak v chladničke uvidíte opičiu hlavu?\r\nOkamžite z chladničky vyberte zrkadlo!', 101, 2.92, 47),
	(10614, 'Ide ťava po púšti a stretne agenta  Jamesa Bonda. Agent sa predstaví: \r\n- Bond! James Bond!\r\nA ťava slušne odpovie:\r\n- Bloud! Velbloud!', 141, 3.44, 47),
	(10615, 'Stoja dvaja snehuliaci vedľa seba a jeden sa pýta toho druhého: \r\n- Čo si taky skleslý?\r\n- Ále, oziabajú ma gule.', 120, 3.21, 47),
	(10616, 'Išli dvaja a prostredný spadol.', 33, 2.65, 47),
	(10617, 'Ide milé prasiatko do lesa na jahôdky. A milý zajačik mu hovorí:\r\n- Prasiatko, ale veď je predsa zima. \r\nA prasiatko na to: \r\n- Ja mám svetrík.', 151, 3.12, 47),
	(10618, 'Išla babka do obchodu a nevyšiel jej krok, tak sa vrátila!', 61, 3.02, 47),
	(10619, 'Lepšie byť aktívny ako rádioaktívny.', 41, 2.55, 47),
	(10620, 'V miestnosti sú traja ľudia. Štyria odtiaľ odídu a potom tam ešte jeden musí prísť, aby tam nikto nebol.', 113, 3.12, 47),
	(10621, 'Najkratší vtip:\r\nCigáň robí.', 33, 3.22, 47),
	(10622, 'Rozprávajú sa dve babky. Z nás troch by bolo perfektné kvarteto.', 68, 2.83, 47),
	(10623, '-Pozri sa. Nefajčí, nepije, nechodí na mariáš, chodí z práce rovno domov, celý deň sa hrá s deťmi. Bodaj by som tak nevyzerala, niekto to zaňho musí robiť.', 169, 3, 47),
	(10624, 'Telefonát:\r\n- Čau, kde si?\r\n- Čo? Ja ťa nevidím!\r\n- Však ja ti telefonujem!\r\n- Ja viem, ale nepočujem ťa!', 113, 2.76, 47),
	(10625, 'Ide blondína po lese a ovracá ju humor.', 41, 2.66, 47),
	(10626, 'Ide babka po púšti a vyschne...', 33, 2.9, 47),
	(10627, 'Po búrlivej noci vyprevádza ona jeho:\r\n- Ahoj!\r\nA hojil tri roky.', 67, 2.85, 47),
	(10628, '"Lienka kam letíš?"\r\n"No a čo!"', 34, 3.1, 47),
	(10629, 'Kolegovia v práci:\r\n- Som hladný. Tu máš 50 Sk, skoč prosím ťa do obchodu a kúp mi 20 dkg šunky. Ak nebudú mať šunku, tak mi kúp niečo iné.\r\nKolega sa o polhodinku vráti a vraví:\r\n- Šunku nemali, tak som ti kúpil 10 päťkorunových známok.', 260, 3.26, 47),
	(10630, 'Sorry, povedal jež a zliezol z kefy.', 37, 2.91, 47),
	(10631, 'Babka, prečo vylievate to mlieko do kanála?\r\nLebo nemám gitaru.', 66, 2.71, 47),
	(10632, 'Nemý hovorí hluchému:\r\n"Kúp si slipy, ty humus."\r\n"Čo hovoríš?"', 70, 2.57, 47),
	(10633, 'Stretnú sa dvaja známi po rokoch a už sa nespoznajú.', 56, 2.71, 47),
	(10634, 'Príde roztrasený dedko ku stánku so zmrzlinou a povie:\r\n- Prosím si zmrzlinu.\r\n- Dobre, ale akú?\r\n- To je jedno, aj tak mi spadne.', 135, 2.96, 47),
	(10635, 'Ide červená čiapočka za babkou. Kráča si po lese a naraz spoza kríka na ňu zvolá vlk:\r\n- Červená čiapočka, čože máš v tom košíčku? \r\nA ona mu na to:\r\n- Chlieb, maslo, syry, mlieko...\r\nVlk: \r\n- A toaleťák tam nemáš?', 238, 3.18, 47),
	(10636, 'Rozhovor na Sibíri: \r\n- Ivan Vasilievič, zabila som vám sliepku.\r\n- A čím Oľga?\r\n- Tým bumerangom, čo ležal na peci.\r\n- Oľga, ešte raz mi zoberieš ponožky, tak ti dolámem deku!', 190, 3.44, 47),
	(10637, 'Slávne výroky, ktoré boli žiaľ posledné:\r\n- Ja som nevedel, že je nabitá.\r\n- Neboj ja s tým viem zaobchádzať.\r\n- Čo asi robí tento gombík?\r\n- Len cez moju mŕtvolu.\r\n- To by si ma musel zabiť.\r\n- Chcel by som to vidieť.', 235, 3.18, 47),
	(10638, 'Viete, z čoho sú zhubné nádory?\r\nZ húb, nie?', 49, 2.69, 47),
	(10639, '- Dežo, vieš abecedu?\r\n- Áno, ale iba do sto.', 48, 3.53, 47),
	(10640, 'Viete aký je rozdiel medzi ježkom a skalou?\r\nSkala je vysoká a ježkovi to vôbec nevadí.', 93, 3.2, 47),
	(10641, 'Dvaja indiáni zablúdia v púšti.\r\n- Vystreľ, povie jeden, možno nás niekto bude počuť.\r\nVystrelí a nič. O chvíľu mu priateľ zasa povie:\r\n- Nože, vystreľ ešte raz.\r\n- Už nemôžem, minuli sa mi šípy.\n', 218, 3.27, 47),
	(10642, 'Stretne sa Jano s Jurom a Jano sa pýta Jura:\r\n- Prečo máš také červené líco.\r\nJuro odpovedá:\r\n- Ále, kúpil som auto za facku.', 136, 3.13, 47),
	(10643, 'Jednoruký muž sa prechádza po Obchodnej ulici  v Bratislave a hľadá secondhand.', 84, 3.03, 47),
	(10644, 'Viete čo je maximálna drzosť?\r\nVystrašiť mŕtvolu až tak, že zomrie!', 75, 2.95, 47),
	(10645, 'Špáram si ihlou v uchu a zrazu ticho.', 39, 3.46, 47),
	(10646, 'Po tráve sa nešliape, tráva sa fajčí.', 42, 3.14, 47),
	(10647, 'Pardón, povedal Ježko, a zliezol z kefy.', 42, 3.12, 47),
	(10648, 'Keď je to na zemi je to červené, keď to štartuje je to modré, keď to \r\nvzlieta je to biele, keď to letí je to fialové, keď to klesá je to zelené, keď to pristává je to čierne, keď to tam len tak leží zhnedne to. Čo je to?\r\nNeviete? Ani ja, ale pekne to mení farby, nie?', 291, 3.11, 47),
	(10649, 'Rozhovor dvoch kamarátov:\r\n- Jano, čo ti je? Si nejaký sklesnutý.\r\n- Ále ide po mne chrípka.\r\n- No to si nejako veríš.', 126, 2.76, 47),
	(10650, '"Koľko?"\r\n"200."\r\n"Čo 200?"\r\n"Čo koľko?"', 44, 3.16, 47),
	(10651, 'Je to červené a kotúľa sa to. Čo je to?\r\nŽltá kocka na ceste.', 68, 2.98, 47),
	(10652, 'Jeden zatvárací špendlík sa sťažuje druhému: \r\n"Je mi teplo!"\r\nDruhý odpovedá: \r\n"Tak sa rozopni."', 107, 3.64, 47),
	(10653, 'Idú tri mravce po púšti a už už idú zomrieť od hladu keď tu zrazu zomrú od smädu.', 91, 3.28, 47),
	(10654, 'Príde Pepo k holičovi s veľmi mastnými vlasmi. Holič sa ho pýta:\r\n- Tak čo Pepo, ostriháme alebo vymeníme olej?', 120, 3.29, 47),
	(10655, 'Inteligentná otázka: Čo je to?\r\nInteligentná odpoveď: Neviem.', 66, 2.62, 47),
	(10656, 'Ak sa pri plávaní chudne, čo potom robia veľryby zle?', 57, 2.68, 47),
	(10657, 'Stretli sa dva magnetofóny. Náš a japonský. Japonský mal očividne výbornú náladu. Náš sa ho pýta:\r\n"A čože si dnes taký veselý?"\r\n"Ale, pán mi kúpil novú kazetu."\r\n"Heeej? A dáš aj mne požuvať?"', 217, 3.07, 47),
	(10658, 'Lieta to okolo lampy a neche si to sadnúť. Čo je to?\r\nLamposed neposedný.', 77, 2.77, 47),
	(10659, 'Idú dva slimáky po koľajniciach a druhý hovorí prvému: \r\n"Ide vlak."\r\nPrvý sa pýta:\r\n"Čo?"\r\nDruhý hovorí:\r\n"Ide vlak."\r\nPrvý:\r\n"Čo?"\r\nDruhý:\r\n"chss..."\r\nPrvý:\r\n"Čo? ...chss"', 189, 3.08, 47),
	(10660, 'V obchode:\r\n"Prosím vás, máte farebné televízory?"\r\n"Áno, nech sa páči!"\r\n"Tak si prosím jeden modrý."', 112, 3.05, 47),
	(10661, 'Vlak prudko zabrzdí uprostred polí. \r\n- Pre Boha, čo sa stalo? – pýta sa vystrašená dáma sprievodcu.\r\n- Nič vážne, iba sme zrazili kravu.\r\n- Bola azda na koľajniciach?\r\n- Nie, naháňali sme ju po poli!', 215, 3.21, 47),
	(10662, 'Viete, ako sa pripravuje krvavý biftek?\r\nZoberiete normálny biftek a dovtedy sa budete šprtať v nose, pokým nebude biftek krvavý!', 135, 2.79, 47),
	(10663, 'Príde Systémový operátor domov a nabootuje televízor.', 58, 3, 47),
	(10664, 'Len tak sa vlečiem prériou a čo nevidím, bizón. Pozriem sa lepšie a naozaj ho nevidím.', 93, 3.57, 47),
	(10665, '- Zajtra mi určite zavolajte.\r\n- Dobre, a keď náhodou nebudem môcť, tak vám zavolám.', 91, 3, 47),
	(10666, 'Čo robia stonožka a stonožiak večer vo svojej diere? \r\nVyzúvajú si topánky!', 82, 3.06, 47),
	(10667, 'Príde tramp k chalúpke, zabúcha na dvere a babke, ktorá otvorí vraví:\r\n- Dobrý deň, babka. Nedali by ste mi pohár vody? Som taký hladný, že by som tu aj prespal.', 173, 3.39, 47),
	(10668, 'Jedzte kravské lajná. Miliardy múch sa predsa nemôžu mýliť!', 66, 3.13, 47),
	(10669, 'Dedko vychádza celý mokrý zo sprchy a dcéra mu hovorí:\r\n"Dedko, utri sa, prechladneš a zomrieš." \r\nDedko poslúchol, utrel sa, prechladol a zomrel.', 154, 3.35, 47),
	(10670, '"Fero máš AIDS?" \r\n"Nie, ale môžem ho zohnať!"', 51, 3, 47),
	(10671, 'Pýtaju sa Steveho Wondera: \r\n"Nevadí Vám že ste slepý?" \r\n"Nie viac by mi vadilo, keby som bol černoch."', 110, 3.49, 47),
	(10672, 'Príde Dedo Mráz do Somálska a pýta sa detí:\r\n"Detičky a prečo ste také chudé?"\r\n"Pretože nepapáme." \r\n"No kto nepapá nedostane darčeky!"', 149, 3.37, 47),
	(10673, 'Dievčatko sa hraje so žiletkou a usmieva sa.\r\nÚsmev je čoraz širší a širší.', 85, 3.77, 47),
	(10674, 'Mama píše synovi na vojnu:\r\nTento týždeň pršalo dva dni. Prvý deň tri dni, druhý deň štyri dni!', 106, 2.76, 47),
	(10675, 'Jeden kvietok hovorí druhému:\r\n- Ľúbim ťa.\r\n- Aj ja teba ľúbim, zavoláme včielku?', 90, 3.6, 47),
	(10676, 'Viete, čo zastaví vypadávanie vlasov?\r\nPodlaha.', 50, 3.01, 47),
	(10677, 'Jano sa stále chváli, že rozpozná všetko, čo mu nalejú do pohára a tak sa ostatní dohodnú a nalejú mu do pohara benzín!\r\n- Fúj vy svine! Však to je BENZÍN!!!\r\n- No hej, ale koľko oktánový?', 206, 3.11, 47),
	(10678, 'Stoja dvaja známi na ostrovčeku a čakajú na autobus.\r\n"Už si si zobral tú peknú mladú babu, čo som Ťa s ňou naposledy videl?"\r\n"Ešte nie."\r\n"A na čo čakáš?"\r\n"Na autobus."', 187, 3.15, 47),
	(10679, 'Ty o tom blúzniš ako rybárik o svojom sexuálnom živote.', 60, 2.97, 47),
	(10680, 'Dobrý den, jmenuji se vťerka a budu u vás bydlet!', 52, 2.97, 47),
	(10681, 'Dežo, dom ti horí!\r\nNemôže, kľúč mám tu.', 48, 3.31, 47),
	(10682, 'Za 7 horami, 7 moriami, 7 dolinami a 7 riekami stojí chalúpka.\r\nV chalúpke za stolom sedí babka a nadáva:\r\n"Prečo práve ja musím tak ďaleko bývať."', 158, 3.15, 47),
	(10683, 'Každý deň príde veľký Johny, namakaný to chlap, do autobusu a hovorí:\r\n- Veľký Johny nemusí platiť.\r\nA ide si sadnúť dozadu. Takto sa to opakuje rok, až sa šofér naserie a začne chodiť do posilovne. Po mesiaci, keď sa šofér vymakal, príde opäť veľký Johny do autobusu a opäť vraví:\r\n- Veľký Johny nemusí platiť.\r\nNato šofér vstane a hovorí:\r\n- A prečo by nemusel?!\r\n- Lebo veľký Johny má preukážku.', 441, 3.51, 47),
	(10684, 'Ako zistí eskimák, že prichádzajú mrazy?\r\nV zákrutách sa mu lámu psy.', 77, 3.2, 47),
	(10685, 'Viete, čo je maximálna slušnosť?\r\nKeď vám šofér v autobuse uvoľní miesto.', 83, 2.88, 47),
	(10686, 'Viete čo je total recall?\r\nKeď bezdomovec zabudne kde býva.', 62, 3.82, 47),
	(10687, 'Ide slimák po kolajniciach a spieva si:\r\n"Já jsem malej šneček, \r\ntramtadá tramtadá.\r\nMám malej domeček,\r\ntududu tududu."', 129, 2.97, 47),
	(10688, 'Po lese ide dedo na bicykli a z kríka vyskočí zbojník a povie:\r\n- Daj dušu alebo peniaze.\r\n- Prednú alebo zadnú?', 119, 3.11, 47),
	(10689, 'Na colnici sa colník pýta:\r\n"Čo máte v kufri?"\r\n"Polovicu prasaťa."\r\n"Živého či mŕtveho?"', 98, 3.29, 47),
	(10690, 'Je to veľké, červené a guľaté. Čo je to?\r\nMalá zelená kocka.', 69, 3.84, 47),
	(10691, 'Je to vo fľaši a nedá sa to vytiahnuť.\r\nVofľašník nevytiahnuteľný.', 75, 3.96, 47),
	(10692, 'Jeden hľadá tón G na klavíri.\r\n- Načo hľadáč G?\r\n- Chcem zahrať Gde domov muj.', 87, 3.04, 47),
	(10693, 'Viete, prečo indiáni pijú čaj zo srdiečkových šálok?\r\nLebo iné nemajú.\r\nA viete, prečo jedia zo srdiečkových tanierov?\r\nLebo je to servis.', 151, 3.09, 47),
	(10694, 'Otázka na rádio Jerevan:\r\nPrečo indiáni pochovávajú mŕtvych za kopec?\r\nLebo tam majú cintorín.', 103, 3.06, 47),
	(10695, 'Príde japonec do baru a hovorí:\r\n- Sian ming von lian tink Coca cola.\r\nČašník sa otočí a opýta sa japonca:\r\n- Počúvaj, dve deci čoho to chceš?', 154, 3.71, 47),
	(10696, 'Lepšie je mať otvorený obchod ako obchodený otvor. ', 55, 3.35, 47),
	(10697, 'Chlapík tlačí na záchode ako najatý. Ide okolo upratovačka a zdá sa jej, že sa zbytočné svieti, tak zhasne. V tom sa spustí hrozný rev, tak znovu zasvieti.\r\n- A čože tak revete?\r\n- Tfuj, to bol sprostý fór! Už som si myslel, že mi vypadli oči!', 262, 3.65, 47),
	(10698, 'Viete aká je absolútna odvaha u ženy? Keď si namiesto vibrátora kúpi zbíjačku!', 86, 2.97, 47),
	(10699, 'Obrázok:\r\nKrásna krajina, v popredí stojí zaľúbený pár:\r\nOn a Off.', 74, 2.81, 47),
	(10700, 'Chlap sedí v reštaurácii a leje na seba polievku. Príde k nemu čašníčka  a hovorí:\r\n- Pane, prečo lejete na seba tú polievku?\r\n- To je polievka? Ja som myslel, že špenát.', 184, 2.66, 47),
	(10701, 'Slnko by malo svietiť v noci, cez deň je svetla dosť.', 56, 3.6, 47),
	(10702, 'Prečo sa so Somálskymi deťmi nechce nikto kamarátiť? Lebo sú také nafúkané. ', 85, 3.31, 47),
	(10703, 'Cez deň to brechá a v noci pláva, čo je to?\r\nSvokrina zubná protéza. ', 75, 3.27, 47),
	(10704, '- Počuj kámo, čo by si dal za moju ženu?\r\n- Nič.\r\n- Dobre, ber si ju!', 74, 3.08, 47),
	(10705, '- Tie sušienky sú stuchnuté. Žeby nová príchuť?', 54, 3.06, 47),
	(10706, 'Príde kostra do mäsiarstva. Predavač ju osloví:\r\n- Želáte si?\r\nKostra mu odpovedá:\r\n- Ďakujem, ja sa len dívam, čo sa práve nosí.', 141, 3.63, 47),
	(10707, 'Viete, ako spoznáte Esmeraldin dom?\r\nNa dverách nie je kukátko.', 66, 2.92, 47),
	(10708, 'Z autodielne:\r\n- Daj mi francuzák.\r\n- Fúúj... kľúč, ty hovädo!', 69, 3.05, 47),
	(10709, '- Pane, prosím vás, neviete náhodou koľko je hodín?\r\n- Nie, ale pozrite ako viem hádzať kamienkom.', 105, 3.14, 47),
	(10710, 'Viete, prečo slimák pije z bodkovaného pohára?\r\nLebo prúžkovaný sa mu rozbil.', 84, 3.21, 47),
	(10711, 'Z rozhovoru bláznov:\r\n- Hádaj, čo mám v ruke?\r\n- Mrakodrap.\r\n- Ty si sa pozeral, že?', 89, 3.24, 47),
	(10712, 'Ide dedo na bicykli a vôbec nepedáluje.\r\nVidia to dvaja policajti a tak ho zastavia a pýtajú sa ho. Dedo ako to že idete a vôbec nepedálujete? A nato im dedo odpovedá.\r\n"Viete, mňa tlačia topánky!!!"', 210, 3.25, 47),
	(10713, 'Tučniak a zebra prišli do fotoateliéru. Fotograf sa pýta:\r\n- Fotočky chcete farebné?', 90, 3.34, 47),
	(10714, 'Je to za stromom a lietajú z toho piliny. Čo je to?\r\nPinochio si holí nohy.', 78, 3.02, 47),
	(10715, '- Ty, Ferko, počúvaj! Tvoja žena smrdí potom!\r\n- No a čo? A tá tvoja aj predtým aj potom!', 96, 3.19, 47),
	(10716, 'Aka je to reťazová reakcia?\r\nKeď dostaneš reťazou po ksichte!', 66, 2.75, 47),
	(10717, 'Čo spraví kapusta, keď ju hodíme do ohňa?\r\nNič.', 53, 2.94, 47),
	(10718, 'Hlod mesiaca:\r\nKeď sa skončil KUKO, tak som sa uzavrel do seba!', 65, 3.13, 47),
	(10719, 'Zrodila sa myšlienka a zúfalo hľadala mozog.', 47, 3.4, 47),
	(10720, 'Viete, čo je to domov dôchodcov? \r\nPomsta detí za jasle.  ', 61, 2.96, 47),
	(10721, 'Som hladný ako hroch.\r\nŠkoda, že som kačka.', 47, 3.32, 47),
	(10722, '- Je drevo vodivé?\r\n- Veruže nie!\r\n- A keď z neho vystrúham drôtik?\r\n- Tak potom už hej.', 94, 3.18, 47),
	(10723, '- Ide Aristid a Tasilo vlakom. Poznáš ten vtip?\r\n- Nie.\r\n- Nie? Ty nepoznáš ako ide Aristid a Tasilo vlakom? A ako nastúpil revízor?\r\n- Nie. A čo bolo ďalej?\r\n- Čo ja viem ... ale začiatok je dobrý, nie?', 214, 2.69, 47),
	(10724, 'Príde zebra do fotoslužby a fotograf sa jej pýta: \r\n- Prajete si farebnú fotku?', 83, 2.63, 47),
	(10725, 'Aké je najlenivejšie zviera na svete?\r\nOrol! Minule som videl letieť zajaca a na ňom sedel orol!', 100, 3.33, 47),
	(10726, 'Ako predídete jarnej únave? \r\nStojte pol dňa na hlave!!!', 59, 3.04, 47),
	(10727, 'Mladý Oravec sa prechádza s dievčinou popri lúkach, ktoré patria jeho otcovi. Vtom jeden býček vyskočí na jalovičku. Vzrušený mladík šepká dievčine do ucha:\r\n- To by som aj ja rád.\r\n- Pokojne môžeš, veď sú to vaše kravy.', 243, 3.41, 47),
	(10728, 'Je to červené a guľaté, čo je to?\r\nModrá kocka.', 53, 3.1, 47),
	(10729, 'Išiel buldozér po lese, udrel doňho blesk a odvtedy sa to miesto volá "Pri jazere."', 87, 3.32, 47),
	(10730, '- Neviete, koľko je hodín?\r\n- Viem.\r\n- Ďakujem.', 50, 3.29, 47),
	(10731, '- Čo to piješ?\r\n- Sekundové lepidlo.\r\n- Čože?\r\n- HMHMHMHM HMHMHMHM!!!', 74, 2.99, 47),
	(10732, 'Ide chlapík po púšti a čo nevidí - bizón!?\r\nPozrie lepšie a ozaj ho nevidí.', 83, 3.39, 47),
	(10733, 'Ako sa volal prvý potápač?\r\nAlexander Buďburuť.', 52, 3.04, 47),
	(10734, 'Špáram sa tak vidličkou v oku a zrazu TMA!', 45, 3.36, 47),
	(10735, 'V tmavej miestnosti:\r\n- Je tu niekto?\r\n- Kto by tu jedol!', 57, 3.67, 47),
	(10736, 'Aký je to pokemon?\r\nMmm rezancová!', 36, 2.83, 47),
	(10737, 'Priložil som mu revolver k čelu a on sa začal smiať. No nezabili by ste ho?', 79, 3.51, 47),
	(10738, 'Rýchlokurz kórejčiny:\r\nprezident spoločnosti > nemako\r\nviceprezident > jakomako\r\nvrátnik > cumako\r\nrobotník > makojakopako\r\nsekretárka > omako', 149, 3.2, 47),
	(10739, '- Pani, ako rozlišujete svojich synov, keď majú rovnaké mená?\r\n- No predsa podľa priezviska.', 98, 3.43, 47),
	(10740, '    * Ak Chuck Norris spadne do vody, nebude on mokrý, ale voda bude Chuck Norris.\r\n    * Chuck Norris spáva s vankúšom pod pištoľou.\r\n    * Všetci nosia pyžamo so Supermanom, Superman nosí pyžamo s Chuckom Norrisom.\r\n    * Neexistuje žiadna teória evolúcie. Existuje iba zoznam živočíchov, ktorým Chuck Norris dovolil prežiť.\r\n    * Najčastejšie príčiny úmrtia v USA sú: 1. srdcové ochorenia, 2. Chuck Norris, 3. rakovina.\r\n    * Keď ide bubák spať, pozrie sa pod posteľ, či tam nie je Chuck Norris.\r\n    * Chuck Norris spáva pri svetle. Nie preto, že by sa bál, to tma sa bojí jeho.', 619, 3.58, 47),
	(10741, 'U riaditeľa v kancelárii: ,,Potom keď budete odchádzať umyte aj výťah! "\r\nupratovačka: ,, Dobre a na každom poschodí? "', 129, 3.65, 47),
	(10742, 'Idú dva ľadové medvede po púšti, jeden sa utopí a druhý je tiež kačica.', 80, 3, 47),
	(10743, 'Si taký smiešny ako suchý rožok...', 38, 3.28, 47),
	(10744, 'Ide slimák po chodníku a vetrá si oči...\r\n', 46, 4.08, 47),
	(10745, 'Idem si tak po púšti a čo nevidím: bizón!\r\nPrizriem sa lepšie a naozaj ho nevidím!!!', 91, 3.28, 47),
	(10746, 'Ide hovno s riťou do pivnice. \r\nhovno hovorí:je tu tma ako v riti A riť na to: ja tiež hovno vidím.', 104, 3.8, 47),
	(10747, 'Ide králik po lese a spieva si idem na medvede idem na medvede ježko to počuje a rýchlo to uteká povedať medveďovi medveď príde ku králikovi a pýta sa ho že čo si to pospevuje a králik nato idem na maliny trepem somariny!!!', 237, 3.48, 47),
	(10748, '-Mami, niečo tu smrdí...\r\n-Mamíí????', 40, 3, 47),
	(10749, 'Nemci naháňajú židov\r\nŽidia sa ukrývajú, našli si studňu a poskákali do nej. Dohodli sa, že budú robiť zo studne ozvenu... Okolo idúci Nemci prišli k studni, zastavili sa a hovoria...\r\nJeden začne: Kde môžu byť židia?\r\nZo studne ozvena: Kde môžu byť židia?\r\ndruhý hovorí: Asi sú v lese?\r\nZo studne: Asi sú v lese?\r\ntretí: Asi sú v studni?\r\nZo studne: Asi sú v studni?\r\nštvrtý hovorí: hodíme tam granát?\r\nZo studne asi: Asi sú v lese!!!!!!', 475, 3.68, 47),
	(10750, '"Budem na titulných stránkach všetkých časopisov a novín", povedal terorista a odpálil sa pred novinovým stánkom.', 122, 3.89, 47),
	(10751, 'Topí sa Anča v rybníku a kričí na ratu.\r\nZačuje ju neďaleko idúci bača a pýta sa:\r\n"Anča a kefovať vieš?"\r\n"Viem, bača, viem, len ma vytiahnite".\r\nBača sa otočí a odchádzajúc ponad plece zakričí:\r\n"Vidíš, Anča, vidíš, plávať si sa mala radšej učiť!"', 280, 3.66, 47),
	(10752, '- Je to odporne slizké a keď na to šliapnete, tak má ropucha smolu. Čo je to??? - Hádanka pre bláznov.\r\n', 111, 3.71, 47),
	(10753, 'Slepý so slepým sú v kine. Jeden slepý sa pýta druhého: \r\n- Vidíš niečo?- Nie.- Tak sa vymeňme.', 105, 3.2, 47),
	(10754, '- Viete aký je rozdiel medzi jablkom a rušňom?- Žiadny, ani jeden nemá zips.', 81, 2.5, 47),
	(10755, '- Prečo židia majú veľké nosy?\r\n- Lebo vzduch je zadarmo.', 62, 3.83, 47),
	(10756, 'Idú dve piškóty po ceste, jednu zrazí auto a druhá jej hovorí: "Čo sa tak mrvíš?"', 90, 3.77, 47),
	(10757, 'Letia dve mušky v lietadle, zrazu do nich narazí nožík, tretia muška odpadne a štvrtá zabočí do stredu.', 112, 2.57, 47),
	(10758, 'Babka si raz doniesla papagája až z Argentíny. Papagájovi začalo byť smutno za svojou krajinou, a tak začal volávať do Argentíny. Babke prišiel však za telefón vysoký účet a tak mu pohrozila: "Ak budeš ešte telefonovať, ukrižujem ťa na stenu!"Papagáj vydržal týždeň nevolať, a potom zase začal.Babka, keďže dostala vysoký účet, ukrižovala papagája na stenu, vedľa krížu pána Ježiša. Papagáj sa pýta Ježiša: "Koľko už vysíš na tomto kríži?""200 rokov!"A papagáj na to: "No do riti, to kam si telefonoval?"', 556, 3.13, 47),
	(10759, 'Manžel pristihne suseda ako vášnivo objíma jeho ženu. Manžel sa pozrie na suseda a vraví mu: "Ach, Feri, Feri, ja musím ale teba sa vážne čudujem."                                     \r\n', 197, 3.1, 47),
	(10760, 'Chuck Norris vydrží v Nonstop bare do záverečnej.', 53, 3.83, 47),
	(10761, 'Viete prečo nemôže mať torta deti? \r\n-??? \r\n-Lebo má rozšľahané vajcia!\r\n', 81, 3.99, 47),
	(10762, 'Dežo chce spáchať samovraždu. Ako tak skáče z 10 poschodia počíta si: "10 poschodie, deviate, ôsme, siedme šieste siedme, ôsme, deviate. Dokelu, zasa tie traky."', 172, 3.53, 47),
	(10763, 'Príde kovboj do baru a zastreli všetkých prítomných okrem jednej krásnej slečny.\r\nPotom k nej podíde a vraví:\r\n"A čo vy tak sama?"', 140, 4.08, 47),
	(10764, 'Ide sopeľ po púšti a vyschne..', 33, 3.14, 47),
	(10765, 'Chromý vraví slepému:\r\n- Ja ťa kopnem.\r\nSlepý na to:\r\n- To chcem vidieť!', 78, 3.88, 47),
	(10766, 'Stretol so slečnu, ktorá mi srdce zlomila\r\npretože viac pív než ja vypila.', 79, 3.57, 47),
	(10767, 'Viete, čo je to "frk zajačí"? No, keď ho tam chlap "frkne" a ona "zajačí"!', 80, 3.92, 47),
	(10768, 'Viete čo je totálny humus? Keď si vytlačíte všetky vriedky, a potom si ich natriete na chleba.', 100, 2.48, 47),
	(10769, '- Viete, aký je rozdiel medzi lietadlom a trenkami?\r\n- Žiadny. Obidve idú v akútnom prípade dole.', 102, 3.93, 47),
	(10770, '- Viete čo je to absolútna staroba?\r\n- ???\r\n- Keď vyjdete z múzea a zapne sa alarm.', 87, 3.96, 47),
	(10771, 'Stretnú sa 4 mušky, prvá žije v očiach, druhá v ušiach, tretia v nose a štvrtá v zadočku.\r\nPrvá hovorí: U mňa je veľa svetla.\r\nDruhá: U mňa je veľa špiny.\r\nTretia: U mňa je veľa zelených panáčikov.\r\nŠtvrtá: Ja keď som šla cez prechod, zrazilo ma hnedé fáro!', 286, 3.85, 47),
	(10772, 'Pani učiteľka vzala deti na exkurziu na stavbu a ako naschvál práve vtedy spadol z lešenia robotník a na mieste bol mŕtvy. Po príchode späť do triedy, pustili sa do rozoberania tohto prípadu.\r\n- Povedz nám Anička, prečo ten ujo spadol?\r\n- Nevedel nič o bezpečnosti práce.\r\n- A ty Miško?\r\n- Určite mal vypité.\r\nVtom sa postaví Móricko.\r\n- Nie, on spal s mojou mamou!\r\n- Prečo si to myslíš?\r\n- Počul som ako kričal "Chlapče, jeb.. ja tvoju mater, netras tým lešením!"\r\n', 498, 4.29, 47),
	(10773, 'Sedí malý chlapček pri kanáli a hrá sa s hovnom. Ide okolo policajt a pýta sa ho: "Chlapček, čo to robíš?"A chlapček odpovie: "Policajta z hovna."Na druhý deň sa situácia opakuje, chlapček sedí pri kanáli a policajt sa opäť pýta, čo robí a chlapček odpovie, že ďalšieho policajta z hovna. Na tretí deň ide zasa policajt okolo chlapčeka a pýta sa: Chlapček, čo robíš? A chlapček na to: Loptu z hovna. A policajt sa pýta: A prečo nie policajta? A chlapček nato: Lebo nemám dosť hovna. ', 523, 3.46, 47),
	(10774, 'Dvaja kamaráti sú na dovolenke v Turecku. Jednému z nich zrazu treba na záchod. Kamarát vyjde z kabínky a tak sa ho pýta: "Ako sa tam mám vyčúrať, keď tam treba kľačať?"A kamarát mu na to hovorí: "Vojdeš dnu, kľakneš si a postupuj takto: 1. stiahneš zips, 2. vytiahneš vtáka,3. stiahneš predkožku,4. vyčúraš sa,5. pustíš predkožku."Chlap vojde do kabínky a začne: 1., 2., 3., 5., 3., 5., 3., 5., 3., 5., 3., 5., 3., 5...', 453, 3.65, 47),
	(10775, '- Je to zelené a skáče to hore-dole. Čo je to? - Žaba vo výťahu. ', 72, 3.11, 47),
	(10776, 'Chuck Norris sa dokáže vysrať v okrúhlej izbe do rohu.', 58, 3.22, 47),
	(10777, 'Viete čo je absolútna rýchlosť?Keď sa človek vyserie z okna na 4 poschodí a dole ho chytá do nočníka.', 111, 3.8, 47),
	(10778, 'Ide turista po púšti, uvidí studňu a kričí: "Voda,vodaaaa,..." A zo studne sa ozve: "Kdeeeee..?" ', 103, 3.63, 47),
	(10779, 'Chuck Norris dokáže popáliť oheň.', 38, 4.14, 47),
	(10780, 'Chuck Norris dokáže prelomiť titánovú tyč na tri polovice.', 64, 3.87, 47),
	(10781, 'Chuck Norris má 11 prstov na jednej nohe.', 42, 3.82, 47),
	(10782, 'Chuck Norris naučil šmirgel ako byť drsný.', 46, 4.14, 47),
	(10783, 'Chuck Norris sa tak dlho pozeral do slnka, kým nežmurklo.', 59, 4.18, 47),
	(10784, '- Viete aké údaje musíte vyplniť, keď sa chcete prihlásiť do upírskej školy?- Meno, priezvisko a krvnú skupinu.', 121, 3.7, 47),
	(10785, 'Muž vtrhne na chirurgiu a kričí: "Rýchlo, odtrhlo mi obidve ruky.."Sestrička vstane a hovorí mu: "A to ste tu museli vtrhnúť bez zaklopania?"', 149, 4.15, 47),
	(10786, 'Chuck Norris vie ako jediný tresnuť kiklopovi medzi oči!', 59, 3.56, 47),
	(10787, 'Chuck Norris vie dať Kiklopovi medzi oči, aj keď ten má len jedno oko.', 74, 3.9, 47),
	(10788, 'Rozprávajú sa, Francúz, Angličan a Slovák. Angličan hovorí: \r\n- My v pondelok začneme stavať hotel a v piatok sa v ňom už býva. \r\nFrancúz nato: \r\n- Monsieur, to nič nie je. My v utorok začneme stavať obchodný dom a v stredu sa už v ňom nakupuje. \r\nA Slováčisko hovorí: \r\n- Ale chlapi, však to furt nič nie je. My začneme v pondelok ráno stavať pivovar a o desiatej sú už všetci opití.', 415, 4.22, 47),
	(10789, 'Keď Boh stvoril Adama a Evu, zostali mu ešte dve veci, ktoré im chcel dať. Boh povedal:  „Mám pre vás ešte dva darčeky, pre každého z vás jeden. Ten prvý je umenie čúrať postojačky a ...“ Adam ho prerušil: „Ja to chcem, ja to chcem! To bude paráda a môj život bude omnoho jednoduchší a veselší!“ Potom sa pozrel na Evu, Eva prikývla a povedala:\r\n“A prečo nie, pre mňa to nie je také dôležité.“ Tak dostal Adam od Boha tento dar. Adam výskal od radosti, poskakoval a čúral hneď sem, hneď tam, bežal na pláň, čúral i tam a obdivoval obrazce, ktoré sa mu podarilo vytvoriť v piesku. Boh s Evou pozorovali Adamovo nadšenie, a potom sa opýtala Eva Boha:  „A ten druhý darček, ktorý si nám chcel dať je aký Bože?“  „To je mozog, Eva. To je mozog.“\r\n', 815, 4.22, 47),
	(10790, 'Snehulienka, Herkules a Quasimodo pred komisiou na zápis do Guinessovej knihy rekordov.\r\nVyjde von snehulienka a hovorí: - zapísali ma ako najkrajšiu na svete.\r\nPotom vyjde Herkules: - zapísali ma ako najsilnejšieho na svete.\r\nNato vyjde nasratý Quasimodo: - Kto do p*** je Martinka z Turca???', 300, 3.93, 47),
	(10791, 'Ide Angličan, Indián a Slovák skákať z mrakodrapu.Angličan kričí: "No, no!"\r\nIndián kričá: "Wata,Wata!"\r\nSlovák skočí a kričí: "Hovno vata, betón!"', 164, 4.09, 47),
	(10792, 'Príde muž pred zrkadlo a hovorí: "Zrkadielko, zrkadielko, kto má najväčšieho chuja na zemi?"A žena mu spoza dverí kričí: "Asi ja."', 141, 4.23, 47),
	(10793, 'Príde kliešť domov a ostatné kliešte sa ho pýtajú:\r\n"Čo ti zase je?"\r\nA kliešť im hovorí:\r\n"Ááále, zas ma vytočily."', 131, 3.85, 47),
	(10794, 'Na diskotéke:\r\n- Dobré svaly, čo berieš?\r\n- Vstupné, debil...', 66, 4.17, 47),
	(10795, 'Varia sa dve vajcia v hrnci. Jedno sa zrazu obráti na to druhé a pýta sa: Počuj, budeme na tvrdo alebo na mäkko? Druhé vajce v šoku sa naň pozrie a vraví: "Či boha, vajce a rozpráva!"', 194, 3.13, 47),
	(10796, 'Ruského veľvyslanca sa pýtajú: "Pán veľvyslanec, vraj v Rusku máte v zime aj -60°C!" \r\n"Ale kdeže! Máme tam okolo -24°C najviac -26°C." \r\n"Ale veď v televízii ukazovali, ako ľudom zamŕzajú uši, prsty aj ich vlastný dych!"\r\n"Jáj, vy myslíte, ako je vonku?" ', 277, 4.15, 47),
	(10797, 'Dievča: Som tehotná!\r\nChlapec: Díki Broňa...\r\nDievča: Čo urobia Vaši?\r\nChlapec: Alebo nás vyhodia alebo to rozchodia...\r\nPríde chlapec domov a hovorí rodičom:\r\nChlapec: Otec, mama, budete mať vnúča!\r\nOco: Ako sa ti to podarilo?\r\nChlapec: To vieš skúsenosti...\r\nOco: Sánka dolu šéfe...', 303, 4.18, 47),
	(10798, 'Syn sa pýta mami: Mami, prečo som ja čierny a ty biela?\r\nSluchaj me, tam bula vtedy taká žúrka, že ty možeš buc rád, že neši pes...!', 144, 4.1, 47),
	(10799, 'Ahoj, volám sa Pupa, mám 55 rokov, narodila som sa 5. 5. 1955, bývam na 5. poschodí v byte číslo 5, a tak som si povedala, že v tom bude nejaká symbolika. Nastúpila som teda na mestský autobus s číslom 5. Išla som na 5. dostihy v tomto roku a stavila som na koňa s číslom 5.\r\n- A čo, vyhrali ste?\r\n- Nie, skončil piaty, kok*t.', 344, 4.29, 47),
	(10800, 'Fero pozerá striptíz. Naživo. \r\nPríde muž a Fero hovorí: Najprv si za striptíz zaplať!\r\nAle je som jej otec.', 116, 3.16, 47),
	(10801, 'Prečo je vojna so somálčanmi nebezpečná?\r\nLebo za každým zrnkom piesku môže číhať nepriateľ.', 105, 3.05, 48),
	(10802, 'Plukovník:\r\n- Tak vojaci, dnes budete mať IQ-testy. Napríklad: tráva je 20cm vysoká, lúka je 50m dlhá, koľko mám rokov?\r\nPrihlási sa jeden a povie:\r\n- 40.\r\n- Ako si to uhádol?\r\n- No tak u nás je jeden polodebil a ten má 20.', 236, 3.5, 48),
	(10803, 'Veliteľ stojí pred nastúpenou rotou a hovorí: \r\n- Vojaci, mám pre vás dve správy. Jedna je smutná a druhá je radostná. Najprv ta smutná: Máme naložiť 20 vagónov piesku. A teraz ta radostná: Piesku mame dosť.', 224, 3.27, 48),
	(10804, 'Stojí vojak na stráži, okolo prejde generál a vojak nič. Generál sa vráti a pýta sa vojaka:\r\n- Vojak, nemali ste má náhodou pozdraviť?\r\n- Hej? A od koho?', 164, 3.47, 48),
	(10805, 'Chlapec píše z vojny: \'Mama, pošli mi buchty a 100 korún.\'\r\nO týždeň mu príde list: \'Milý syn! Buchty ti neposielam, lebo trúbu máme na vojne. A desať korún sa píše len s jednou nulou. Tvoja mama.\'', 212, 3.25, 48),
	(10806, 'V Bagdade idú autom dvaja členovia Al-Kajdy a jeden hovorí druhému:\r\n- Vieš čo? Vyhoď ma pred americkým veľvyslanectvom!', 129, 3.19, 48),
	(10807, 'Na vojne som bol obľúbený. Volali má bonzák.', 49, 3.16, 48),
	(10808, 'Vojaci hrajú v kasárňach hru "Hádaj na čo myslím". Jeden hovorí:\r\n- Je to chlpaté?\r\n- Nie!\r\n- Tak potom je to pivo.', 123, 3.28, 48),
	(10809, 'Synáčik generála v trestaneckom tábore sa díva do studne. Zavolá si jedného väzňa a hovorí mu:\r\n- Tu sa postav na kraj, predkloň sa a vystri ruky.\r\nTen to urobí a chlapčisko ho sotí dolu. Chvíľu sa zasa pozerá do studne a zavolá ďalšieho:\r\n- Zdvihni pravú nohu a upaž ľavú ruku.\r\nOpäť chudáka sotí dolu a pozerá do studne. Vtom vyjde z domu pani generálová a zakričí:\r\n- Karolko, prestaň sa už hrať tetris a pod obedovať.', 458, 3.18, 48),
	(10810, 'Vojenský:\r\n- Páni - hovorí pred nastúpeným plukom vyše 70-ročný plukovník, ktorý má veľmi mladú ženu - mojej žene sa narodil syn. Dakujem Vám!', 158, 3.21, 48),
	(10811, 'Pod Trenčianskym hradom bola veľká bitka medzi Turkami a Slovákmi. Turci vystrelia guľu na hrad... Za chvíľu potom Slováci, potom Turci, potom Slováci, potom Turci, potom Slováci... a zrazu je ticho. \r\nTurci kričia na Slovákov:\r\n"Čo nestrieľate zbabelci!!!"\r\nA z hradu sa ozve:\r\n"Ja ti dám zbabelcov, však vy máte guľu!!!"', 340, 3.48, 48),
	(10812, 'Príde dôstojník ponorky na mostík a pýta sa:\r\n- Kto stlačil červený gombík? \r\nNikto nič.\r\n- Pýtam sa vás, kto stlačil červený gombík?\r\nTicho ako v hrobe. Dôstojník kývne rukou a hovorí:\r\n- A čert s ním s Novým Zélandom.     ', 248, 3.27, 48),
	(10813, 'Moskva roku 1941. V rozhlase:\r\n- Vnímanie, vnímanie...\r\nRa-ta-ta-ta-bum. Ra-ta-ta-ta-bum.\r\n- Achtung, achtung.', 112, 3.08, 48),
	(10814, 'Na leteckej súťaži je prvá cena super nová americká stíhačka a ako cena útechy česky čmeliak. Po skončení súťaže nasledujú predvádzacie lety cien. Česi, aby nezostali v hanbe, priviažu čmeliaka o stíhačku. Obe lietadla vzlietli, a po chvíli pilot stíhačky hlási: \r\n- Letím rýchlosťou zvuku a čmeliak stále za mnou.\r\nAsi o desať minút pilot, už trochu nervózny, opäť hlási: \r\n- Letím dvojnásobnou rýchlosťou zvuku, prvý raz mením geometriu krídel a čmeliak stále za mnou.\r\nPo chvíli pilot už celý bez seba hlási: \r\n- Letím trojnásobnou rýchlosťou zvuku, druhý raz mením geometriu krídel, čmeliak odhadzuje kabínu a podvozok a ešte len prvý raz mení geometriu krídel!!!', 732, 3.72, 48),
	(10815, 'Veliteľ si dal zavolať dvoch vojakov a hovorí:\r\n- Budete skladníkmi výbušnín. \r\nVojaci celý šťastní, len tak ležia celý deň medzi bedňami a fajčia cigarety. Naraz vojde veliteľ a zakričí: \r\n- Čo to robíte?! Takto už vyletelo sto ľudí do vzduchu!  \r\nA jeden sa ozve: \r\n- A čo kričíte? My sme len dvaja!', 328, 2.95, 48),
	(10816, 'Pýtajú sa deti uja.\r\n- Ujo, boli ste partizánom?\r\n- Nein!', 60, 3.06, 48),
	(10817, 'Vietnamská vojna. Na hranici beží vojak vpred s bielou zástavou a kričí: \r\n- Mier! Mier!\r\nA na druhej strane ostrelovač hovorí: \r\n- Však mierim, len sa toľko nehýb!', 175, 3.78, 48),
	(10818, '- Pán veliteľ, kedy už dostaneme hrebene?\r\n- Do kelu, aké hrebene? - kričí veliteľ.\r\n- Veď ste hovorili, že máme prečesať okolie.', 141, 3.04, 48),
	(10819, 'Silvestrovský večer na posádke. Veliteľ objednal dokonca i stripteas. Dievčina se objaví pred vojakmi, búrlivý potlesk. Dievčina odhadzuje jednu časť odevu po druhej a potlesk je stále slabší a slabší. Keď dievčina ostane celkom nahá na javisku, v sále je hrobové ticho. Dievčina celá zmätená hovorí:\r\n- Chlapci, čo sa vám nepáčim?\r\nA zo sály se ozve zastenanie:\r\n- Páčiš, ale ako máme tlieskať jednou rukou?', 444, 3.42, 48),
	(10820, 'Stretnú se dvaja kamaráti z vojny: \r\n- Ahoj Karol, to som rád, že ťa vidím. Spomínaš si na Fera? \r\n- Neviem, koho myslíš? \r\n- No ten, čo nás zchránil tým, že skočil pod tank s plnými vreckami granátov a skôr než zomrel stačil zavolať: Za stranu a za ľudí.\r\n- Ahá, Fero. Ale ten nevolal za stranu a za ľudí, ale: Zasratý ľad.', 353, 3.14, 48),
	(10821, 'Generál americkej armády skúša nových vojakov,ktorý majú ísť do Vietnamu .\r\n"Preskúšam si vás ako ovládate výzbroj Vietnamcov.Čo je to kbp?"\r\n"Je to krátka banbusová palica."\r\n"Správne.A čo je to dbp?"\r\n"Dlhá banbusová palica."\r\n"Správne,a čo je to sdbppl?"\r\nVojaci nevedia.\r\n"No predsa špeciálne dlhá banbusová palica proti lietadlám."', 364, 3.9, 48),
	(10822, 'Traja slováci stoja na kopci a dole sa valí státisicová turecká armáda. Ten prvý hovori :\r\n"Hej, tých je ale veľa !"\r\nDruhý hovorí :\r\n"Ej bisťu veru že máš pravdu."\r\nA tretí hovorí :\r\n"Kam ich len šeckých pochováme !"', 237, 3.34, 48),
	(10823, 'Do roty príde odkaz, že vojakovi Marečkovi zomrel otec. A rozpráva sa Generál s veliteľom roty, a hovorí mu:\r\n- Počúvajte, povedzte to tomu Marečkovi, ale tak šetrne, je totiž veľmi citlivý.\r\n- Ale samozrejme, ja som tiež veľmi citlivý.\r\nTak si veliteľ nechá nastúpiť všetkých vojakov o štvrtej ráno a hovorí.\r\n- Všetci, čo majú otca, dva kroky dopredu.\r\n- Do boha Mareček, ty kam ideš?', 417, 3.21, 48),
	(10824, 'Na vojne:\r\n- Póóózor! Čo sa to tam hýbe?\r\n- Zemeguľa.\r\n- Kto to povedal?!\r\n- Galileo.\r\n- Galileo nech okamžite vystúpi z radu!', 134, 3.42, 48),
	(10825, 'Na chodníku stretne veliteľ vojaka.\r\n- Pán vojak a nemali ste ma tak náhodou pozdraviť? \r\n- A od koho pán veliteľ?', 121, 3.02, 48),
	(10826, 'Rok 1943, hlboká noc. V strede lesa v chalúpke je sama babička. Zrazu niekto klope na dvere:\r\n- Zdravstvujte, mi rusky partizáni. \r\nA babka sa ich pýta: \r\n- A koľko vás je? \r\n- Zweiundzwanzig.', 199, 3.33, 48),
	(10827, 'Začínajúci pilot je na prvom lete. Z riadiaceho centra dostáva príkazy:\r\nRC: - Prudký manéver vpravo.\r\nP: - To som čakal.\r\nRC: - Obrat 3G.\r\nP: - To som takisto čakal.\r\nRC: - A nakoniec dvojitá vývrtka.\r\nP: - Tak to som nečakal.\r\nPo pristátí si ho hneď zavolá veliteľ a skríkne na neho: \r\n- Čo to malo znamenať?  To som čakal, to som nečakal?!\r\n- No to máte tak. Že sa pri manévri pomočím, to som čakal, že pri obrate 3G pustím do gatí, to som tiež čakal, ale že mi to všetko pri vývrtke vybehne von rukávmi, to som nečakal.', 561, 3.52, 48),
	(10828, 'Idú dvaja vojaci po lese a jeden z nich šlapne na mínu.Jeden skončí s menšími odreninami,druhému natrhne ústa.\r\nA vojak s odreninami vyčíta druhému:\r\n"Čo sa smejes ty pako,však sme sa mohli zabiť!"', 212, 3.12, 48),
	(10829, 'Hovorí otec synovi:\r\n- Na vojne sme mali taký kanón, že sme ho čistili dva týždne.\r\n- To bol taký veľký?\r\n- Nie, my sme boli takí leniví.', 149, 3.12, 48),
	(10830, 'Čo sa stane, ak bude vojna medzi Pakistanom a Indiou?\r\nNastane vojna volov.', 76, 2.98, 48),
	(10831, 'Vojenské cvičenie. Veliteľ si dá nastúpiť vojakov a hovorí: \r\n- Vojaci, pokazila sa tankova vysielačka. Kto ju vie opraviť? \r\nZ rady vystúpi vojak a pýta sa: \r\n- Digitálna alebo analógová?\r\nA veliteľ hovorí:\r\n- Opakujem pre debilov. Pokazila sa vysielačka v tanku!', 281, 3.64, 48),
	(10832, 'Turci dobíjajú hrad. Strelia z dela. Hradní vojaci strelia do turkov z dela. Zasa Turci strelia z dela. Vojaci strelia na turkov z dela. Chvíľa ticha, turci čakajú a nič. Tak revú na vojakov: \r\n- No čo nestrieľate, vzdávate sa?\r\nVojaci sa naklonia z hradu a revú: \r\n- Nevzdávame, ale guľu máte vy!', 313, 3.25, 48),
	(10833, 'Rádiokorešpondenčne na mori:\r\n1234:\r\n"Americká letadlová loď, změňte kurz o 15st. jižne."\r\nUSS: \r\n"Kanadsky 1234, zde kapitán americké letadlové lodi, vy změňte kurz o 15st. severne."\r\n"Americká letadlová loď, vy změňte kurz o 15st. jižne."\r\n"Kanadsky 1234, zde kapitán americké letadlové lodi s 64 bojovými letouny na palube, vy změňte kurz o 15st. severne."\r\n"Americká letadlová loď, OPAKUJI VY změňte kurz o 15st. jižne."\r\n"Kanadsky 1234, zde kapitán americké letadlové lodi s doprovodnými plavidly, největší námorní vojenské síly na svete, VY zmeňte kurz o 15st. severne."\r\n"Americká letadlová loď, VY změňte kurz o 15st. jižne, tady kanadsky\r\nmaják."', 706, 3.19, 48),
	(10834, 'Traja generáli, námorný, pozemný a vzdušný sa hádali, kto má\r\nodvážnejších vojakov. Veliteľ pozemných vojsk dal svojmu vojakovi rozkaz postaviť sa pred idúci tank. Vojak povedal:\r\n- Rozkaz! \r\nPostavil sa pred tank, tank z neho urobil placku a druhí dvaja generáli uznanlivo kývali hlavami:\r\n- To bolo dosť odvážne.\r\nVeliteľ námorných vojsk nariadil svojmu vojakovi zastaviť padajúcu kotvu. Vojak povedal:\r\n- Rozkaz!\r\nVrhol sa za kotvou a padol s ňou mŕtvy do hlbín. Druhí dvaja generáli uznanlivo kývali hlavami:\r\n- To bolo dosť odvážne.\r\nVeliteľ vzdušných vojsk nariadil svojmu vojakovi zastaviť za chvost pristávajúceho MIGa. Vojak odpovedal:\r\n- Čo ti jebe?\r\nA ostatní dvaja generáli uznanlivo kývali hlavami:\r\n- To bolo VEĽMI odvážne.', 786, 3.66, 48),
	(10835, 'Je to zelené, ostrihané a skáče to. Čo je to?\r\nVojak na diskotéke.', 72, 3.19, 48),
	(10836, 'Major: - Súdruhovia, kruh má 180 stupňov.\r\nVojak: - Ale súdruh major, veď kruh má 360 stupňov.\r\nMajor: - Vojaci, predstavte si taký maličký 180 stupňový kruh.', 170, 3.14, 48),
	(10837, 'Kapitán si po pol roku dá nastúpiť posádku:\r\n- Výmena ponožiek !\r\n- HURÁ !!!\r\n- Diktujem: Mrkvička s Novákom; Hlavatý s Brucháčom ...', 146, 3.12, 48),
	(10838, 'Obdobie studenej vojny. Američania tajne trénujú svojho najlepšieho agenta, aby sa infiltroval do sovietskeho zväzu a podával im správy. Keď príde ďeň akcie, američania vysadia svojho agenta hlboko v ruskej tajge, ďaleko od civilizácie, aby si nikto nevšimol odkiaľ prišiel.\r\nAget po chvíľke cesty zbadá starého rusa. Ten sa ku nemu priblíži a povie mu:\r\n"Što ty tu robiš? Ty ne rus."\r\nAgent odpovedá:\r\n"Ja rus."\r\nA na dôkaz vyexuje liter vodky a zatancuje mu perfektný kazačok. Ale rus stale hovorí svoje:\r\n"Ty ne rus."\r\nAgent zase:\r\n"Ja rus!"\r\nA na dôkaz mu perfektne zahrá na balalajke a perfektne zaspieva ľudovú pesničku. Ale rus zase:\r\n"Ty ne rus."\r\nAgent už zistí že je prezradený a tak volá na základňu:\r\n"Akcia nevyšla, spoznali ma."\r\nZo základne sa mu ozvú:\r\n"OK, akcia sa ruší, priprav sa na vyzdvihnutie."\r\nA potom ešte ticho dodá:\r\n"Na vás černochov sa fakt nedá spoľahnút."', 941, 2.99, 48),
	(10839, 'Tichomorské pobrežie USA, noc, vlnobitie, hustá hmla. Na radare lode pobrežnej hliadky sa objaví nezreteľný odraz. Rádiový dialóg:\r\n- Neznáme plavidlo, tu loď pobrežnej hliadky USA, identifikujte sa!\r\n- ---\r\n- Opakujem, pre neznáme plavidlo. Tu loď pobrežnej hliadky USA, okamžite sa identifikujte!\r\n- ---\r\n- Neznáme plavidlo, ako loď pobrežnej hliadky USA voči vám použijeme silu a zahájime paľbu pokiaľ sa okamžite neidentifikujete!!!\r\n- O.K., tu lietadlová loď USS Nimitz, oznámte nám, keď budete pripravení.', 544, 3.35, 48),
	(10840, 'Viete prečo vojak vyhľadáva pôdu?\r\nLebo pôda má dva faktory: 1.Je všade, 2.A vojak ju vyhľadáva. (To je podľa skutočnosti!)', 134, 2.72, 48),
	(10841, 'Kupé vo vlaku, štyria cestujuci. Matka s dcérou a kapitán s vojínom. \r\nVlak vbehne do tunela a ozve sa facka.\r\nMatka: "Hm, vojak pokúšal dcéru a tá mu jednu sekla."\r\nDcéra: "Hm, vojak ma chcel ošahávať a ošahával matku, tak ju dostal."\r\nKapitán: "Boha, vojak si užíva a mňa bijú."\r\nVojak: "Ešte jeden tunel a vrátim ti aj tú druhú."', 356, 3.04, 48),
	(10842, 'Na vojne sa predstavujú.\r\n"Moje meno je major Kotík. Pre koktavých som Dušan."', 82, 3.3, 48),
	(10843, 'Čo má vojak v nohaviciach?!\r\nVojak má v nohaviciach chodiť!!!', 65, 2.8, 48),
	(10844, 'Kde končí zdravý rozum, začína vojenská logika.', 53, 2.93, 48),
	(10845, 'Dežo skáče počas vojenského výcviku na padáku z lietadla. Pred výskokom sa pýta poručíka:\r\n"Pán poručík a čo mám robiť?"\r\n"Zatiahni za túto šnúrku a otvorí sa ti padák"\r\n"A keď sa neotvorí?"\r\n"Tak zatiahni za túto druhú a otvorí sa záložák"\r\n"A keď sa neotvorí ani ten"\r\n"Tak roztiahni ruky, mávaj nimi a krič: Ja som vták fénix, ja som vták fénix..."\r\nPo chvíľi Dežo vyskočí, zatiahne za šnúrku - nič. Zatiahne za druhú - zase nič. A tak len roztiahne ruky a letí dole.\r\nPoručík to všetko vidí a myslí si už je po ňom. Sadne k pilotovi a letia na letisko.\r\nPo chvíli sa vedľa kabíny objaví Dežo, zbesilo máva rukami a kričí: \r\n"Pán poručík, aký to som vták?"', 728, 3.28, 48),
	(10846, 'Pilot volá na základňu:\r\n- Chlapi, čo mám robiť?! Lietadlu už skoro došlo palivo a som veľmi ďaleko od pobrežia! Navyše neviem plávať!\r\n- Opakuj po mne. Otče nás, ktorý si na nebesiach...', 204, 2.95, 48),
	(10847, 'Čo má napísané pyrotechnik na chrbte?\r\n"Keď ma uvidíte utekať, snažte sa ma predbehnúť!" ', 99, 3.09, 48),
	(10848, 'Pri odvode:\r\n- Schopný vojenskej služby...\r\n- Ale ja som krátkozraký!\r\nDo kartotéky lekár dopísal: Schopný na boj zblízka!', 131, 2.91, 48),
	(10849, 'Na rannom nástupe sa generál pýta nováčikov, ktorí spravili nejaký trapas. \r\n- Z ktorého družstva ste? - zreve na nich \r\n- JRD BUDKOVCE. ', 146, 2.99, 48),
	(10850, 'Rozprávajú sa dvaja dedkovia v parku na lavičke:\r\n- Vieš čo? Ja ti už ani neviem, či som bol zranený v prvej alebo druhej svetovej vojne.\r\n- To nič. Ja viem, že som bol zranený v druhej svetovej, ale neviem či som dostal guľkou medzi lopatky alebo lopatkou medzi guľky.', 283, 2.84, 48),
	(10851, 'Generál slovenskej armády píše list generálovi ruskej armády:\r\nTie rakety zem-vzduch čo ste nám poslali na testy fungujú vynikajúco, ale nabudúce nám pošlite rakety zem-lietadlo.', 191, 2.93, 48),
	(10852, 'Veliteľ: "Vy ste mi nejaký múdry vojačik."\r\nVojak: "Kto? Ja?"\r\nVeliteľ: "No a hádam nie ja!"', 98, 2.97, 48),
	(10853, 'Nie je úplne jasne, prečo si pre vojnu s Britániou Američania vybrali Irak.', 79, 2.9, 48),
	(10854, 'Američania sú veľmi podnikaví. Saddám vypísal odmenu za každého zabitého vojaka a oni sa začali strielať navzájom. ', 127, 3.15, 48),
	(10855, 'Zo záznamov amerického velenia:\r\nTaktika použitia bojových delfínov sa v púšti osvedčila iba čiastočne.', 113, 2.92, 48),
	(10856, 'Dnes bolo zaznamenané prvé nesplnenie rozkazu pilota vzdušných síl USA, ktorý odmietol bombardovať pozície britských vojsk.', 132, 2.94, 48),
	(10857, 'Kapitán hovorí vojakovi:\r\n- Slanina, zamaskujte sa tak, aby vás nerozoznala ani krava od trávy.\r\n- V poriadku. Ale mám otázku. Čo mám robiť, keď ma začne tá krava žrať?', 182, 2.86, 48),
	(10858, 'Do kasární príde telegram, že vojakovi Furtákovi zomrela matka. Veliteľ sa rozhodne oznámiť mu to čo najšetrnejšie. Pri nástupe vraví vojakom:\r\n"Kto má matku nech urobí jeden krok dopredu." \r\nVšetci urobia jeden krok. Veliteľ zreve.\r\n"Vojak Furták kam sa tlačíte?"', 284, 3.07, 48),
	(10859, 'Výsluch na Gestape:\r\n- Vaše meno?\r\n- Profesor Horák.\r\n- Hansi, podaj žeravý kutáč!\r\n- Nie, nie, nie! Fučík! Fučík!', 125, 3.46, 48),
	(10860, 'OSN sa pýta Busha:\r\n- A odkiaľ viete, že Hussajn má všetky tie zbrane, ktoré tvrdíte, že má?\r\nBush sa usmeje a odpovedá:\r\n- Ešte stále mám odložené dodacie listy!', 177, 4.07, 48),
	(10861, 'Predpoveď počasia pre Irak:\r\nRáno B-2, na obed F-14 a v noci striedavo F-12 a v nižších polohách Komanče. Na niektorých miestach je možnosť výskytu aj Tomahawkov.', 174, 3.19, 48),
	(10862, 'Rozpráva sa Bush so svojim zbrojným inšpektorom z Iraku:\r\nBush: - Počuj, má ten Sadám nejakú atómovú bombu?\r\nInšpektor: - Hmmm, nie, je mi ľúto, žiadnu tam nemajú.\r\nBush: - Tak im tam jednu hoďme.', 211, 2.94, 48),
	(10863, 'Dôstojníci na bále. Jeden hovorí:\r\n"Ak dnes poručík Rzevskij nezačne hneď po príchode hovoriť nejaké oplzlosti, na mieste sa zastrelím!"\r\nA za chvíľu už prichádza poručík Rzevskij:\r\n"Páni, pohovorme si dnes o hudbe..."\r\nOzval sa výstrel a Rzevskij pokračuje:\r\n"...napríklad ráno som Natašu pomiloval na klavíri."', 337, 3.83, 48),
	(10864, '"Vojak Ivanov!"\r\n"Tu!"\r\n"Dvadsať krokov vpred!"\r\n"Jeden, dva, tri, štyri, päť, ... Pán major, viac to nejde, je tu stena."\r\n"To nevadí päť stačí. Rota! Na môj povel, páľ!"', 184, 3.06, 48),
	(10865, 'Generál sa pokúšal nastúpiť do preplneného autobusu, ale nejaký vojak sa prepchal okolo neho a obsadil mu miesto. Generál ho začal napomínať.\r\n"Prepáčte, pán poručík."\r\nGenerál naštvaný ukazuje na zlaté pásiky na výložkach.\r\n"Oh, prepáčte, pán major."\r\nGenerál zelený od zúrivosti ukazuje na dubové vetvičky.\r\n"Odpáľ, horár!"', 359, 3.27, 48),
	(10866, '- Zdravím, pán poručík. Tí siedmi vojaci včera v tom muničnom sklade mali smolu, čo?\r\n- Sedem? Bolo ich predsa deväť.\r\n- Aha. Tak mi ich ešte raz poskladáme, možno máte pravdu.', 190, 3.32, 48),
	(10867, '"Súdruh praporčík, čo by ste robili, keby nebolo armády?"\r\n"Bol by som požiarnikom."\r\n"A keby nebolo požiarnikov?"\r\n"Tak by som bol policajtom."\r\n"A keby nebolo ani polície?"\r\n"To je jedno, aj tak by som nič nerobil."', 226, 3.43, 48),
	(10868, 'Vojaci v Afganistane v zákope, prestrelka.\r\n"Genadij, aký zápach má krv?"\r\n"Daj teraz pokoj! Nevidíš, ako dusmani pália?"\r\nPo chvíli prestrelka trochu utíchla.\r\n"No, čo si to chcel?"\r\n"Že čím vonia krv?"\r\n"Hovnom!"\r\n"Och, Geňa! Tak ja som celý zakrvavený!"', 272, 3.03, 48),
	(10869, 'Poručík si zvolá nováčikov a pýta sa ich:\r\n- Je medzi vami niekto, kto sa rozumie elektrine?\r\n- Ja, pán poručík - prihlási sa vojak Šmarc. - Mám elektrotechnickú priemyslovku.\r\n- Výborne vojak. Tak na izbe dohliadni, aby bolo o desiatej večer zhasnuté!', 268, 3.26, 48),
	(10870, 'Jano sa dal na vojne odfotiť nahý od pol pása a do pol pása. Rodičom chcel poslať hornú časť a frajerke dolnú. Omylom poslal dolnú časť rodičom. Mama ukazovala fotku susedke a hovorí:\r\n- Celý náš Janko. Oči vypúlené, nos červený a brada neoholená!', 271, 3.22, 48),
	(10871, 'Vojak pošle babičke list, z ktorého trčí špagátik:\r\n- Ahoj babička! Ak potiahneš za ten špagát, dostanem tri dni dovolenky!  ', 136, 3.06, 48),
	(10872, '- Tak čo pán poručík, čo urobím s tým zastreleným?\r\n- Pošlite mu domov faktúru na náboje!', 100, 3.86, 48),
	(10873, 'Ide dedko po parku a ťahá za sebou po tráve nohu. Stretne druhého, tiež vojnového veterána, ktorý sa ho pýta:\r\n"Čo dedko, od frontu, od frontu?"\r\n"Ale, čoby od frontu! Od hovna, od hovna!"', 199, 3.39, 48),
	(10874, 'Na vojne ráno:\r\nVojak, čo ste robili večer?\r\n"Mal som vychádzku, bol som na pivo."\r\n"A vy ste robili čo?"\r\n"Ja som onanoval."\r\n"Vojak, vy ste ako trávili večer?"\r\n"Miloval som sa s bandaskou."\r\n"A vojak vy?"\r\n"Ja som vojak Bandaska."', 240, 3.27, 48),
	(10875, 'Veliteľ pluku k nastúpenému pluku:\r\n- Vojaci, narodil sa mi syn. Ďakujem Vám!', 82, 3.17, 48),
	(10876, 'Vojaci dostali svoju prvú vychádzku. Kapitán hovorí jednému z nich.  \r\n- A nie že tam vonku vykonáte nejakú somarinu. \r\n- Vykonám!', 139, 3.16, 48),
	(10877, 'Plukovník na vojne zaraduje bažantov do skupín:\r\n- Tí, ktorí vychodili strednú a vysokú školu sa zaradia do prvého radu. Tí, ktorí vychodili základnú do druhého radu.\r\nHlas zo zadu:\r\n- A čo tí,ktorí nevychodili žiadnu školu?\r\n- Tí sa zaradia za mňa!', 270, 3.72, 48),
	(10878, 'Major dá na vojne nastúpiť mužstvo a predstavuje sa im:\r\n"Volám sa major Kotík , pre koktavých som Jožo!"', 113, 3.03, 48),
	(10879, 'Ide človek okolo základne a pýta sa.\r\n- Vojak, čo strážiš.\r\n- Zbrane.\r\n- A to mi povieš len tak? Čo keby som bol zlý špión.\r\nRatatatatatata.\r\n- Kto by to bol o ňom povedal?!', 186, 3.26, 48),
	(10880, 'Dvaja vojaci vidia lietadlo a jeden hovorí:\r\n-Bbola by haluz, keby by to bol vládny špeciál.\r\nTen druhý mu na to:\r\n- To nemôže byť vládny špeciál, nemá pred sebou motorky.', 183, 2.69, 48),
	(10881, 'Viete, ako ide ranený vojak cez mínové pole?\r\nNajpv normálne, potom každá noha zvlášť.', 95, 2.89, 48),
	(10882, 'Dvaja vojaci na fronte. Jeden druhému hovorí:\r\n- Jevgenij, striľaj!\r\nRatatataratatata\r\n- Ne do mňa.', 103, 3.16, 48),
	(10883, 'Na vojenčine pri cvičných streľbách sa kapitán pýta vojaka:\r\n- Vojak, čím vy sa vlastne živíte v civile?\r\n- Prečo sa pýtate, pán kapitán?\r\n- Ja nič, len vás tak pozorujem, že vždy, keď vystrelíte, tak vytiahnete vreckovku a poutierate všetky otlačky na zbrani.', 283, 3.29, 48),
	(10884, 'V zákope boli dvaja vojaci a zrazu tam spadne bomba.\r\nJednému vojakovi bomba roztrhne ústa od ucha k uchu.\r\nA ten druhý vojak mu hovorí: \r\n- Ty blbec, čo sa smeješ, veď nás to mohlo zabiť!', 198, 2.78, 48),
	(10885, 'Viete ako zbadáte ruskú plošticu vo vašej spálni.\r\nMáte tam o jednu skriňu naviac.', 89, 3.15, 48),
	(10886, 'Aký je rozdiel medzi sliepkou a vojakom?\r\nSliepka musí znášať vajcia a vojak všetko.', 90, 2.91, 48),
	(10887, 'Hittler vysvetľuje svojim vojakom....\r\nZrazu jeden vojak kýchne.\r\n"Kto to bol?",pýta sa Hittler.\r\nNikto sa nehlási.Vystrieľa prvý rad a pýta sa:\r\n"Kto to bol?"\r\nNikto sa nehlási.Vystrieľa druhý rad a pýta sa:\r\n"Kto to bol?"\r\nNikto sa nehlási. Vystrieľa ďalší rad.Keď už vystrieľa asi 50 radov, vystúpi vojak a hovorí:\r\n"To som bol ja"\r\n"Nazdravie!!!"', 371, 3.83, 48),
	(10888, 'Malý Janko sa pýta svojho deduška.\r\n- Dedko, stretol si sa ako partizán za druhej svetovej vojny s nacistami?\r\n- Veru hej. Plazím sa s chlapmi po lese a zrazu pred nami na čistinke plný rebriňák nemcov. Pomaly odistím ručný granát, zatvorím oči a hodím. Otvorím oči a čo nevidím. Ja a plný rebriňák nemcov.', 329, 3.21, 48),
	(10889, 'Druha svetová vojna:\r\n- Ivan Ivanovič, nemci!\r\n- Hádž granát Míša!\r\n- Hádžem, Ivan Ivanovič. Chytajte!', 112, 3.09, 48),
	(10890, 'Hlási vojak kapitánovi:\r\n- Pán kapitán, zostrelili sme 10 lietadiel, z toho 1 nepriateľské.', 97, 3.82, 48),
	(10891, 'Definícia vojaka: \r\nHmota, odetá do zelených handier, ktorá sa dáva do pohybu za pomoci rozkazov a nadávok.', 113, 2.82, 48),
	(10892, 'Vietnam, tma, dusno, amereckí vojaci v plnej poľnej v zákope a s napätím pozerajú do tmy. Zrazu priletí päť granátov a vybuchnú v tesnej blízkosti. Vojaci postupne dvíhajú hlavy, oprašujú sa. Jeden vyťahuje cigaretu. Veliteľ na neho kričí:\r\n- V žiadnom prípade si nezapaľuj.\r\nVojak s mrmlaním dáva balíček späť do vrecka:\r\n- Pred chvíľou sme mohli zdochnúť a jemu vadí pasívne fajčenie.', 422, 3.03, 48),
	(10893, 'Mladý dôstojník na ministerstve obrany pracoval dlho do večera. Keď konečne odchádza z kancelárie, vidí na chodbe generála, ako stojí pri skartovači s papiermi v ruke. \r\n- Viete ako táto vec funguje? - pýta se generál.  - Môj pobočník už išiel domov a ja neviem ani kde se to zapína. \r\n- Áno, pane.\r\nNato dôstojník pristúpi k prístroju, zapne ho, vezme generálovi z ruky papiere a vloží ich dovnútra. \r\n(chvíľa ticha)\r\n- A teraz - hovorí generál - by som z toho potreboval po jednej kópii.', 524, 3.25, 48),
	(10894, 'Viete, pečo nemôžu vojakov z povolania popraviť na elektrickom kresle?\r\nPreto, lebo guma je izolant.', 104, 3, 48),
	(10895, 'Keď som bol malý, maminka mi vravievala:  "Papaj chlapče, papaj, aby si bol veľký a vzali ťa na vojnu." A ja vôl som žral a žral! ', 139, 3.28, 48),
	(10896, 'Všetci sú proti mne, nikto má nemá rád. Mohol by som u teba prespať? \r\nUsama Bin Ladin.              ', 107, 3.22, 48),
	(10897, 'Vojak ide na svoj prvý zoskok. Je očividne nervózny. Všimne si to jeho veliteľ a snaží sa ho povzbudiť: \r\n- Buď v pohode. Potiahneš za žltú šnúrku a otvorí sa padák. Keby sa neotvoril, potiahneš za červenú, to je náhradný padák. A i keby sa ten neotvoril, nič sa nedeje, dole je trampolína. \r\nTak vyskočí, potiahne za žltú šnúrku - a nič. Potiahne za červenú - a zase nič. Vtom vidí, ako oproti nemu (zospodu nahor) letí nejaký muž. Tak sa ho radšej spýta: \r\n- Prosím vás, je dole trampolína? \r\n- Ja neviem, ja som z plynárne.\n', 571, 3.95, 48),
	(10898, 'Na cvičení velí generál:\n"Vojaci! Na kone!"\nJeden z vojakov odvetí:\n"Ja nemôžem, prosím, ja mám vlka."\nGenerál na to:\n"Vy na vlka, ostatní na kone!"              ', 173, 3.82, 48),
	(10899, 'Veliteľ hovorí k nastúpenému pluku:\n- Vojaci, narodil sa mi syn. Ďakujem vám!              ', 97, 3.75, 48),
	(10900, 'Po pol roku vojny si veliteľ dá nastúpiť rotu:\n- Výmena ponožiek!\n- Huráááá!\n- Diktujem:Kovár s Gálom,Kaluža s Hrončekom...              ', 151, 3.75, 48),
	(10901, 'Stretnú sa dve bomby a vravia: "Poďme si tikať!"              ', 65, 3.4, 48),
	(10902, 'Správa z moskovských novín:\r\n"Na sovietsko-čínskych hraniciach, prepadol čínsky agresor pokojne  orúci sovietsky traktor. Traktor paľbu opätoval, útočníka odohnal a odletel..."              ', 203, 4.06, 48),
	(10903, 'Stojí Čukča na stráži. Ide okolo akýsi chlap a pýta sa:\r\n”Čukča, čo to strážiš?”\r\n”Vojenský sklad.”\r\n”A čo je v tom sklade?”\r\n”Delostrelecká munícia pre náš 21. delostrelecký pluk.”\r\n”A to všetko mi prezradíš len tak? Čo keď som americký špión?”\r\nOzve sa dávka zo samopalu a chrčanie umierajúceho. Čukča si hundre popod nos:\r\n”Kto by to o ňom bol povedal...”              ', 430, 4.2, 48),
	(10904, 'V armáde:\r\n”Vojak Metlička, vy neviete, že pitie vína vo veľkom množstve zabíja?”\r\n”Vojak sa nesmie smrti báť, pán kapitán!”              ', 157, 4.18, 48),
	(10905, '21. augusta 1968 vraví žena mužovi:\r\n”Vstávaj, starý, sme obsadení!”\r\n”Ale veď to by Rusi nedovolili.”              ', 131, 2.93, 48),
	(10906, 'Fero stretne Joža a vraví mu:\r\n”Ty, Jožo, vieš, že s našou veľkou armádou môžeme ísť do NATO?\r\n”S ktorou?” čuduje sa Jožo.\r\n”No, s tou armádou nezamestnaných!”              ', 199, 2.63, 48),
	(10907, 'OSN sa pýta amerického prezidenta:\r\n- A odkiaľ viete, že menovaný terorista má všetky tie zbrane, ktoré tvrdíte, že má?\r\nPrezident sa usmeje a odpovedá:\r\n- Mám odložené dodacie listy!              ', 212, 3, 48),
	(10908, 'Jeden pilot hovorí druhému:\r\n”Povedz parašutistom, aby prestali vyskakovať. Ešte sme nevzlietli!”              ', 120, 4.16, 48),
	(10909, '- Pán veliteľ, hlásim, že vojak Sergejev vyskočil bez padáka!\r\n- Už zase?!!              ', 96, 3.76, 48),
	(10910, '- Trestám vás, vojak Karanduľa za to, že ste v noci opitý dostali do kasárni fúrik. Máte niečo na svoju obhajobu?\r\n- Mám, v tom fúriku ste boli vy, pán poručík.              ', 188, 4.27, 48),
	(10911, 'Na vojenskom cvičení: \r\n- Všetci na kone! \r\n- Ja nemôžem, ja mám vlka. \r\n- Tak na vlka!              ', 107, 3.4, 48),
	(10912, 'Parašutista pri voľnom páde: \r\n„Pán kapitán! Nemôžem otvoriť padák!"\r\nKapitán zakričí z lietadla:\r\n„Nič sa nebojte, veď je to iba cvičenie!"\n', 160, 4, 48),
	(10913, 'Poručík Samolevskij sa preberá po včerajšej chlastačke, v hlave mu treští, v hube ako v polepšovni a vidí pucfleka, ako mu čistí uniformu. Aby to aspoň nejako zachránil, hovorí mu: "Človeče, včera na bále úplne normálne tancujem a zrazu príde ku mne nejaký vojačik a celý frak mi ogŕcal. Z fleku som mu dal 7 ostrých basy." "Málo ste mu dali. Ešte sa vám aj vysral do nohavíc."              ', 422, 4.03, 48),
	(10914, 'Ide pohrebné auto veľkou rýchlosťou okolo kasárni. V zákrute z neho vypadne rakva. Mŕtvola sa vymrští na plot. Vyletí strážnik a vystrieľa do nej celý zásobník. Sanitka odvezie „streleného" do nemocnice. O dve hodiny vyjde z operačnej sály doktor, utrie si orosené čelo a vraví: „Sakra, bola to fuška..., ale bude žiť."\n', 349, 4.08, 48),
	(10915, '"Vojaci, teraz vás naučím plaziť sa po rovnej zemi!" velí nastúpenej jednotke kapitán. \r\n"Ale Zem je guľatá!" ozve sa hlas z jednotky. \r\n"Kto to povedal?" \r\n"Kopernik!" odpovie ten istý hlas. \r\n"Kopernik, päť krokov dopredu!"\n', 238, 4.25, 48),
	(10916, 'V kupé vlaku idú vojak, lampasák a matka s dcérou. Vlak vojde do tunela. Ozve sa mlasknutie bozku a potom hrozná facka. Lampasák si myslí: \r\n- Vojak si užíva a mňa za to fackujú. \r\nMatka si myslí: \r\n-To mám ale slušne vychovanú dcéru. \r\nDcéra si myslí: \r\n- Keby ten vojak nebol také drevo, tak si ma nemôže spliesť s matkou. Vojak si myslí: \r\n- Až bude zase tunel, tak zase mľasknem a strelím mu ešte väčšiu.              ', 452, 3.55, 48),
	(10917, 'Grófka prišla do vojenského tábora, ktorý finančne podporuje, a pýta sa jedného pacienta: \r\n- Ako ste sa zranil?\r\n- Šrapnelom...\r\n- Och, vybuchol a zasiahol vás? \r\n- Nie. V noci sa priplížil a uhryzol ma!!!              ', 232, 3.6, 48),
	(10918, '”Chlapci, nemôžete ten granát píliť. Veď vám vybuchne!” \r\n”Nevadí, pán poručík. My máme ešte jeden.”               ', 136, 4.05, 48),
	(10919, 'Na vojenskom cvičení začalo pršať. Plukovník vraví:\r\n"Omáčka, skočte sa pozrieť do auta, či tam mám plášť!"\r\nPo hodine sa vráti:\r\n"Plukovník, plášť v aute máte!"\n', 184, 4.11, 48),
	(10920, 'Rotný hovorí pred útvarom:\r\n"Budúcu nedeľu bude prehliadka. Ak bude ráno pršať, prehliadka bude popoludní. Keby však pršalo popoludní, bude prehliadka ráno."\n', 171, 3.94, 48),
	(10921, 'Veliteľ si nechá nastúpiť celú posádku a vraví:\r\n- Vojaci, máme nový sejf. Je na nom 8 miestna kombinácia. Samé 5, ale poradie vám nepoviem.              ', 166, 2.84, 48),
	(10922, 'Čapajev sa pýta vojakov: \r\n"Potrebujú vtáky peniaze?"\r\nPo jednoznačne negatívnej odpovedi zvolá:\r\n"Vojaci, orly moje! Prepil som váš žold!"              ', 163, 3.42, 48),
	(10923, 'Syn ide na vojnu, tak mu otec dá poštového holuba, aby mohol poslať správu domov. Po troch mesiacoch sa syn dostane domov a čuduje sa, prečo mu neposlali buchty, ktoré písal, že chce. Rodičia mu zase vyčítali, že o sebe vôbec nedal vedieť. Vtom niekto klope na dvere. Otec ide otvoriť a keď sa vráti, dá synovi strašnú facku a vraví:\r\n- Ty hlupák, nabudúce, keď budeš posielať poštového holuba, tak mu rozviaž krídla. Prišiel pešo!\n', 466, 4, 48),
	(10924, 'Janko píše Marienke z vojny:\r\n- Ak budem v sobotu môcť, tak prídem! Marienka posiela telegram:\r\n- Budeš môcť! Príď!\n', 126, 4, 48),
	(10925, 'Čukčafilm natáča vojnovú epopeju Mladá garda o skupine mladých antifašistov, ktorú viedol Oleg Koševoj. Klopanie na dvere.\r\n- Kto tam?\r\n- Gestapo!\r\n- Čevo nada?\r\n- Partizana!\r\n- Kakovo?\r\n- Olega Koševogo!\r\n- Olega pošla v tundru plakaty na derevo lepit a mosty v vozduch vzryvat.\r\n- Togda, kogda on verňjotsa, skažite jemu, što zdes bylo gestapo a očeň serdilos.              ', 394, 2.93, 48),
	(10926, 'Partizáni chytia Nemcov a začnú si ich zapisovať...\r\n- Kak tibja zavut?\r\n- Was?\r\n- Aha, tibja zavut Was. I kak zavut tibja? - otočí sa k druhému.\r\n- Was?\r\n- Oo, bratia Wasovci... a kak zavut tibja? - otočí sa k ďalšiemu.\r\n- Was?\r\nJednu mu treskne, Nemec sa chytí za bradu a zaplače:\r\n- Warum?\r\n- No vidíš - hovorí partizán - mňa neoklameš. Píšem si - Warum.              ', 392, 3.95, 48),
	(10927, 'Stojí vojak na kolajniciach a veliteľ naňho skríkne:\r\n- Pozóóóóóóóóóóóóóóóóóór!!!!!-\r\nVojak skočí do pozoru a... prejde ho vlak.\n', 153, 3.77, 48),
	(10928, 'Na jednom vojenskom cvičení bolo hlavnou úlohou maskovanie. Generál na inšpekcii sa odrazu rozkričal, keď videl jeden kmeň stromu, ako začal odrazu poskakovať. Nechal si dotyčného zavolať: \r\n"Vojak, uvedomujete si, ako bolo vaše chovanie nezodpovedné a nebezpečné? V bojovej situácii by to mohlo stáť životy celej jednotky!" \r\n"Pane, keď si zo mňa kŕdeľ holubov urobil cvičný terč, zaťal som zuby a vydržal to. Keď mi dva psy načúrali do topánok, povedal som si, že už bolo aj horšie. Ale keď mi po nohách vyliezli dve veveričky k rozkroku a jedna povedala: \'Jeden zjeme teraz a druhý si schováme na zimu..."              ', 664, 4.27, 48),
	(10929, 'Nový príslušník parašutistickej jednotky sa chystá k svojmu prvému zoskoku. Pozorne si prejde svoje poznámky zo školenia: "1. Vyskočiť z lietadla. 2. Počítať do 20 a zatiahnuť za ľavú šnúrku. 3. Ak sa neotvorí padák, zatiahnuť za pravú šnúrku. 4. Ak sa ešte stále neotvorí padák, zatiahnuť za obe šnúrky naraz. 5. Po doskoku vyhľadať transportér a hlásiť sa veliteľovi." Vojak vyskočí, počíta, zatiahne za ľavú šnúrku - a nič. Po chvíli zatiahne za pravú, bez zmeny. Zneistie, zatiahne za obe a stále nič. Naštvaný vojak zareve: \r\n"Ak tam dole nebude čakať ten transportér, tak ma teda pekne naserú!"              ', 671, 4.27, 48),
	(10930, 'Veliteľ útvaru sa vráti zo štábu a jeho zástupca mu podáva hlásenie - za jeho neprítomnosti k žiadnej mimoriadnej udalosti nedošlo. Až, ako hovorí, na jednu zlomenú lopatu. \r\n”Akú lopatu?”\r\n”Zlomila sa, keď sme pochovávali toho záklaďáka.” \r\n”Akého záklaďáka?” \r\n”Zhorel pri výbuchu muničného skladu.” \r\n”Akom výbuchu?” \r\n”Ten som spôsobil ja v opilosti nedopalkom z cigarety.” \r\n”Nechajte si už tie fóry. Predsa viem, že nefajčíte ani nepijete!” \r\n”Tiež by ste začali fajčiť a piť, keby váš starý odišiel na štáb, vy ste mali jednotku na krku a niekto vám ukradol zástavu!”               ', 668, 3.9, 48),
	(10931, 'Mladý dôstojník na ministerstve obrany pracoval dlho do večera. Keď konečne odchádza z kancelárie, zbadá na chodbe generála, ako stojí pri skartovačke s hromadou papierov v rukách. \r\n”Viete, ako táto vec funguje?”, pýta sa generál, ”môj pobočník už išiel domov a ja ani neviem, kde sa to zapína.” \r\n”Áno, pane!”. \r\nNa to dôstojník pristúpi k prístroju, zapne ho, vezme generálovi z ruky papiere a vloží ich do skartovačky. Po chvíli ticha sa ozve generál: \r\n”tak a potreboval by som z toho po jednej kópii...”              ', 573, 4, 48),
	(10932, 'Stojí vojak na koľajniciach a veliteľ naňho zakričí:\r\n-Pozóóór!\r\nVojak skočí do pozoru a prejde ho vlak.', 115, 3.69, 48),
	(10933, 'Príde vojak za seržantom a pýta sa : ako to tu môžte vydržať bez sexu na takej púšti taký dlhy čas ? seržant : no dá sa to, ale keď už nevydržíš tam v stajni je ťava .. tak vojak už nevydržal pretiahol ťavu a celý zničený ide za seržantom : seržant ako to môžte s tou ťavou , však to nie je možné . Seržant : normálne nasadnem na ťavu a idem do mesta za babami.', 397, 3.69, 48),
	(10934, 'Píše otec synovi list na vojnu: Pribalil by som ti aj tisíc korún, ale už som zavrel obálku.', 98, 3.74, 48),
	(10935, 'Nemecký vojak sa pýta mladého žida: \r\n"Koľko máš rokov?" \r\nŽid mu na to: "Bude mi sedemnásť, pane!"\r\n"Asi ťažko!"', 125, 3.95, 48),
	(10936, 'Vojak podáva správu generálovi:\r\n- Pán generál počas mojej služby sa nestalo nič vážne, iba sme zlomili násadu od lopaty.\r\n- A prečo ste zlomili lopatu?\r\n- To keď sme zakopávali strážneho psa...\r\n- A čo sa stalo strážnemu psovi ...\r\n- Prešlo ho hasičské auto ...\r\n- Preboha, čo tu robili hasiči?!?\r\n- Hasili muničný sklad.\r\n- A to ste mi to nemohli povedať hneď???\r\n- Hej, ja vám to poviem hneď a vy sa zastrelíte ako major.', 455, 3.86, 48),
	(10937, 'Kapitán sa na vojne postaví pred nováčikov a hovorí: "Volám sa kapitán Kot. Ale pre tých čo koktajú, som Fero."', 121, 3.59, 48),
	(10938, 'Rus Slovak a Američan sa rozprávajú kto má lepšiu bojovú techniku. Rus povie: "My máme také dobré lietadlá, že by zbombardovali celé Spojené štáty!" Američan mu nato odpovie: "My máme zas dobré tanky, ktoré by tie vaše lietadlá zostreľovali jedno za druhým.A Slovák im vraví: "My máme toľko cigáňov,  že vám to všetko pokradnú!"', 361, 3.94, 48),
	(10939, 'Rusi, Nemci, Česi a Slováci letia v lietadle. Príde letuška a vraví: "Sme ťažký, niekto musí vyskočiť."Rus začne: "Sme Rusi? Sme! Sme silní? Sme! Tak vyskočíme! a vyskočili.O 5 minút príde letuška a opäť vraví: "Sme ťažký, niekto musí vyskočiť." Nemec povie: "Sme Nemci? Sme! Sme silní? Sme! Tak vyskočíme! a vyskočili.O 10 minút príde letuška opäť a vraví: "Sme stále ťažký, niekto musí vyskočiť.." A Slovák sa ozve: "Sme Slováci? Sme! Sme silní? Sme!...tak vyhodíme Čechov!"', 526, 4, 48),
	(10940, 'Vietnamská vojna.\r\nNa hranici beží vojak vpred s bielou zástavou a kričí: "Mier! Mier!"\r\nA na druhej strane ostreľovač hovorí: "Však mierim, len sa toľko nehýb!\'"', 174, 3.37, 48),
	(10941, 'Viete prečo Hitler spáchal samovraždu?Lebo mu prišiel nedoplatok za plyn..', 78, 3.27, 48),
	(10942, 'Generál na vojne dáva rozkazy vojakom: "Ľahnúť, vztyk, ľahnúť, vztyk!"Generál prechádza medzi vojakmi a zrazu si všimne jedného z vojakov, ktorý nič nerobí, a preto sa ho spýta: "Vojak, prečo nič nerobíš?"A vojak odpovedá: "Čakám kým sa rozhodnete."', 273, 3.96, 48),
	(10943, 'K vojakom v púštnej krajine nastúpi na misiu nový vojak a po týždni sa ich pýta: \r\n- Chlapi, ako to tu vydržíte bez žien? \r\nJeden mu povie: - Keď chceš, tu máš kľúče a tam vzadu v stajni je ťava. \r\n- Tak to ešte vydržím - odpovie mu nováčik. Ale po týždni mu to nedá a poprosí o kľúče, po 3 hodinách vyjde von a pýta sa: \r\n- Chlapi, ako to robíte s tou ťavou?\r\nA jeden mu povie: - Tak normálne... sadneme na ňu a ideme do dediny.', 465, 3.97, 48),
	(10944, '- Viete prečo sa pes odstrelil?- Lebo dostal šek za plyn.\r\n       ', 68, 2.25, 48),
	(10945, 'Traja generáli, námorný, pozemný a vzdušný sa hádali, kto má odvážnejších vojakov. Veliteľ pozemných vojsk dal svojmu vojakovi rozkaz postaviť sa pred idúci tank. Vojak povedal:\r\n- Rozkaz!\r\nPostavil sa pred tank, tank z neho urobil placku a druhí dvaja generáli uznanlivo kývali hlavami:\r\n- To bolo dosť odvážne.\r\nVeliteľ námorných vojsk nariadil svojmu vojakovi zastaviť padajúcu kotvu. Vojak povedal:\r\n- Rozkaz!\r\nVrhol sa za kotvou a padol s ňou mŕtvy do hlbín. Druhí dvaja generáli uznanlivo kývali hlavami:\r\n- To bolo dosť odvážne.\r\nVeliteľ vzdušných vojsk nariadil svojmu vojakovi zastaviť za chvost pristávajúceho MIG-a. Vojak odpovedal:\r\n- Čo ti jebe?\r\nA ostatní dvaja generáli uznanlivo kývali hlavami:\r\n- To bolo VEĽMI odvážne.', 785, 4.22, 48),
	(10946, 'Vojna je v plnom prúde. Sovietsky partizán uteká pred Nemcom, hľadá miesto, kam sa schovať. Vtom uvidí babku na roli, ako kope zemiaky. Nuž uteká za babkou a poprosí ju, či sa môže schovať pod jej sukňu. Babka prikývne. Nemec babku obíde a nič si nevšimne. Sovietsky vojak je celý natešený a začne si k babke dovolovať, začne jej dávať dolu nohavičky...No vtom ho babke spod sukne vytiahne a povie: "Čo ti šibe? Veď aj ja som prezlečený partizán!"', 481, 4.13, 48),
	(10947, 'Dežo dôjde z vojny a hovorí tatkovi.\r\n"Tato pozri čo som donisov z vojny." A Dežo ukáže granat.\r\nA tato hovorí: "Dežo vyskúša me ho?"\r\nA Dežo odpovie: "Dobre." Tak odistev granát a ven oknom ho hodev do záhrady.\r\nA tatko hovorí: "Škoda, že to nevidela babka."\r\nA Dežo sa pýta: "A de bola??"\r\nA tatko na to: V záhrade na hajzli."', 348, 3.63, 48),
	(10948, 'Náčelník hovorí mužom: "Mužov znásilnite a ženy zabite!"Jeden muž hovorí:"Nie naopak? Nie mužov zabiť a ženy znásilniť?"Pupuš sa ozve a hovorí:"Chlapci počúvajte to čo náčelník hovori!"', 208, 3.47, 48),
