	(11042, 'Premiér na mítingu vraví občanom:\r\n"My chceme len vaše dobro!"\r\nObčania:\r\n"Ale my si ho nedáme!"              ', 117, 4.26, 50),
	(11043, 'Prečo sme najnezávislejšou krajinou v Európe?\r\nLebo od nás už nič nezávisí.              ', 98, 4.14, 50),
	(11044, 'Oznam na vrátnici internátu:\r\nProsíme študentov aby z okna nevyhadzovali odpadky, malé deti ich zbierajú a nafukujú.              ', 137, 4.13, 50),
	(11045, 'Pride dievča pláčuce domov a sťažuje sa mame: "Mami v triede ma prezývajú šimace, to znamená šialene malé cecky." \r\nZ vedľajšej izby sa ozve hlasný otcov smiech. Mama zakričí: "Ty buď ticho šimape."              ', 230, 4.03, 50),
	(11046, 'Pýta sa chodec chodca:\r\n- Čo tam hľadá tá pani?\r\n- Päťkorunu.\r\n- Ako to viete?\r\n- Lebo som ju našiel ja.              ', 126, 3.9, 50),
	(11047, '"Karol, vraj si prestal piť!"\r\n"Je to pravda."\r\n"A čo ťa k tomu doviedlo?"\r\n"To, čo sa deje okolo nás. Vôbec nemám chuť vidieť to dvakrát."              ', 163, 4.17, 50),
	(11048, '"Ocko, zvýšili cenu cigariet. Teraz budeš menej fajčiť?"\r\n"Nie, synček, teraz budeš ty menej jesť."              ', 121, 3.92, 50),
	(11049, 'Čo je to jašterica?\r\nKrokodíl, čo prežil hospodársky zázrak na Slovensku.              ', 94, 4.15, 50),
	(11050, 'Kedysi sme bojovali o lepší zajtrajšok, dnes bojujeme medzi sebou o prežitie.              ', 95, 4.19, 50),
	(11051, 'Ide Slovák po pláži a nájde fľašu. Hneď ju otvorí a z nej vystúpi Gin a povie: "Splním Ti každé želanie pod podmienkou, že Tvoj sused bude mať 2x toľko" Slovák sa zamyslí a odpovie:"Vieš čo? Vypichni mi jedno oko."              ', 248, 4, 50),
	(11052, 'Slovák sedí na brehu potoka a chytá ryby. Po dosť dlhej dobe konečne jednu chytí a hneď zlatú.\r\n„Ak ma pustíš, splním ti tri želania!“\r\nSlovák ju teda pustí. Po chvíli sa rybka vynorí a čaká. Slovák sa zamyslí, ale neverí, a tak skúsi:\r\n”Chcem fľašku borovičky!“\r\nZahrmia hromy blesky a objaví sa fľaša borovičky.\r\n„Hmm. Dobrá!“, s údivom povie Slovák a zahodí prázdnu fľašu.\r\n„Chcem, aby v tomto potoku tiekla borovička!“\r\nHromy blesky, ochutná a fakt borovička. Načiera plné hrste a v tom ho rybka preruší:\r\n„A tvoje tretie želanie?“\r\n„Nalej ešte pol deci!“              ', 642, 3.92, 50),
	(11053, '"Kam sa chystáte v tomto roku na dovolenku?"\r\n"Manželka na Kanárske ostrovy, dcéra do Grécka a syn do Ameriky."\r\n"A vy?"\r\n"Pravdepodobne do basy!"\n', 152, 4.13, 50),
	(11054, 'Zhovárajú sa dvaja chlapci:\r\n”Aj vy sa pred obedom modlíte?”\r\n”Nie, naša mama varí dobre!”              ', 117, 4.05, 50),
	(11055, '”Pán vrchný, ale ja som chcel iba dva deci koly a nie tri!” \r\n”Prepáčte, pane, ale môžem vás uistiť, že v tej trojdecovej fľaši sú aj tak len dva deci.”              ', 186, 3.9, 50),
	(11056, 'Pýta sa psychológ pacientky:\r\n”Netrpel u vás niekto gigantomániou?”\r\n”Ale áno! Môj manžel občas vyhlási, že je hlavou rodiny.”              ', 158, 3.92, 50),
	(11057, 'Aký je na Slovensku najlepší prostriedok na chudnutie?\r\nPoberanie dôchodku.              ', 93, 4, 50),
	(11058, '21. augusta 1968 vraví žena svojmu mužovi:\r\n”Vstávaj, starý, sme obsadení!”\r\n”Ale veď to by Rusi nedovolili!”              ', 138, 3.56, 50),
	(11059, 'Stalo sa v Čechách. Dcéra príde z prvého rande domov o hodinu neskôr. Matka z obývačky kričí: ”Dallas, Dallas!”\r\nDcéra na to: ”Copak si myslíš, že jsem coura?”              ', 195, 3.37, 50),
	(11060, 'Deň po Mikulášovi sa chorá mamička pýta v nemocnici manžela:\r\n”Ako sa dcérke včera páčilo.”\r\n”Strašne.” oznamuje manžel. ”Keď ju čert s Mikulášom zbadali, tak sa zľakli, že okamžite vzali nohy na plecia a nechali u nás všetky darčeky!”              ', 284, 4.1, 50),
	(11061, 'Ocko, rastú v zime jablká?”\r\n”Jablká nie, ale ich cena áno.”              ', 84, 3.73, 50),
	(11062, 'Pacient lekárovi:\r\n”Prosím vás, diagnostikujte mi nejakú inú chorobu. Na túto nemám peniaze.”              ', 118, 3.75, 50),
	(11063, 'Otec rodiny sa chystá zabiť vianočného kapra, ale ten sa mu vyšmykne a začne skákať po celom byte. Vtedy to zbadá manželka a začne kričať:\r\n”To si celý ty! Čo ti to vôbec napadlo kupovať lietajúcu rybu?!”              ', 240, 3.74, 50),
	(11064, '”Jano, za čo si ty vlastne sedel za komunistov?”\r\n”Uložil som knihy vo výklade kníhkupectva.”\r\n”A čo? Boli zakázané?”\r\n”Neboli, ale dal som vedľa seba tri knihy s názvami: Chceme žiť ... Ďaleko od Moskvy ... V tieni mrakodrapov.”               ', 272, 4.13, 50),
	(11065, 'Stretne Jano kamaráta.\r\n”Juro, počul som, že rozprávaš dobre po anglicky.”\r\n”Áno.”\r\n”Tak čo potom znamená why?”\r\n”Prečo.”\r\n”Iba tak sa pýtam.”              ', 186, 3.95, 50),
	(11066, 'Príde Pepo k holičovi s veľmi mastnými vlasmi. Holič sa ho pýta:\r\n”Tak čo Pepo, ostriháme alebo vymeníme olej?”              ', 138, 3.91, 50),
	(11067, 'Rozprávajú sa dve susedky :\r\n-Počula som, že susedka Krhličková žije nemravným životom .\r\n-Veru tak. Každý piatok ju stretávam v takých pochybných podnikoch, kam by som ja sama nikdy nevkročila .\n', 211, 3.95, 50),
	(11068, 'Rozprávajú sa dvaja Američania:\r\n”Počúvaj, Joe, Bill ešte nemá motorku. Kúpme mu jednu.” Kúpili.\r\nRozprávajú sa dvaja z Izraela:\r\n”Počúvaj, Izak nemá žiaden obchod. Kúpme mu jeden.” Kúpili.\r\nRozprávajú sa Piťo a Dežo:\r\n”Ty počúvaj, Fero ešte nesedel...”              ', 303, 4.19, 50),
	(11069, 'Slovenský bača sa chváli svojim honelníkmi:\r\n”Chlapci moji, tá viagra je výborná medicína. Zjedol som len pol tabletky a hneď som vyprášil... celú fľašu slivovice!”              ', 196, 3.6, 50),
	(11070, 'Arab je na dovolenke vo Vysokých Tatrách. Ráno si vyjde pred hotel a začne prášiť svoj perszký koberec. Bača to zbadá a pýta sa: "Čo Aladin neštartuje?!"              ', 180, 3.82, 50),
	(11071, 'Brácha! "Ty miluješ lepšie ako tata. Aj mama povedala."              ', 72, 3.5, 50),
	(11072, 'Aký je rozdiel medzi WC papierom a motorovou pílou?\r\nŽiadny. Stačí malá nepozornosť a prst je v riti!              ', 122, 4, 50),
	(11073, 'Príjde chlap domov a horoví rodine:\r\n- Tak a kúpime si prasa, urobíme jaterničky, tlačenku, klobásky...\r\n- Potom sa zamyslí, príde k synovi a dá mu facku. Manželka sa ho pýta:\r\n- Prečo ho biješ?\r\nA otec na to:\r\n- Už ho vidím, ako to žere bez chleba...              ', 282, 4.19, 50),
	(11074, 'Zídu sa traja - Američan, Rus a Slovák - a hádajú sa, ktorá z ich krajín je najmravnejšia. Tak vypustia lietadlo s meracím prístrojom a dostali takéto výsledky:\r\n- Nad USA namerali, že milostným hrám sa venuje šesťdesiat percent obyvateľov.\r\n- Nad Ruskom to bolo štyridsať päť percent.\r\n- Nad Slovenskom iba desať percent.\r\nSlovák sa začne naparovať a vyťahovať, že Slováci sú mravný národ. Vtom sa k nemu nakloní pilot a šepká mu:\r\n- Veď mi to aj dalo poriadne zabrať, lietať celé hodiny iba nad pionierskými tábormi.              ', 574, 3.91, 50),
	(11075, 'Pýtajú sa turisti baču:\r\n”Bača Jano, prečo vás vaši honelníci volajú ”prezident”?”\r\n”No... To odvtedy, čo som si kúpil dvojplatničku...”              ', 174, 3.82, 50),
	(11076, 'Vracia sa uťahaná žena z práce domov, v rukách tašky s nákupmi. \r\nZrazu pred ňu vstúpi exhibicionista a rozhrnie si kabát. Žena zúfalo vzdychne: \r\n- Bože, ja som zabudla kúpiť vajcia.               ', 213, 3.8, 50),
	(11077, 'Žena hovorí mužovi: "Idem na 5 minút k susedke. A hlavne nezabudni každú polhodinu pomiešať guláš!"               ', 124, 4.2, 50),
	(11078, 'Stretnú sa dvaja známi:\r\n- Kde si sa narodil?\r\n- Ta v Košicoch.\r\n- Ktorá časť?\r\n- Ta celý v Košicoch.              ', 123, 4.1, 50),
	(11079, 'Janko, plávaj otvoriť dvere, ide inštalatér.              ', 62, 4, 50),
	(11080, 'Zo života.\r\nVčera som sa stal Svedkom Jehovovým. Nie kvôli tej viere, ale aby ma prestali otravovať pri dverách.              ', 132, 4, 50),
	(11081, 'Dedko si skúšal topánky a pritom si prdol. Ospravedlňoval sa, keď predavačka chápavo dodala: \r\n- Keď vám poviem koľko stoja, tak sa aj poseriete.              ', 169, 4.24, 50),
	(11082, 'Môj priateľ má veľký problém. Je zo zmiešaného manželstva. Jeho matka bola Svedkyňa Jehovova a jeho otec ateista. \r\nA on chudák, každé ráno cestou do práce obchádza domy v susedstve, klope ľuďom na dvere a keď otvoria, nemá, čo by im povedal.\n', 264, 3.85, 50),
	(11083, 'Príde Karkulka za babičkou a pýta sa:\r\n"Babička, prečo máš tak veľké uši?"\r\n"Aby som ťa lepšie počula."\r\n"Prečo máš tak veľké oči?"\r\n"Čo nevidíš, že seriem!"\n', 181, 3.8, 50),
	(11084, 'Klopanie na dvere. \r\n"Kto je tam?"\r\n"Jehovisti."\r\n"A čo chcete?"\r\n"Rozprávať sa."\r\n"A koľko vás je?"\r\n"Dvaja."\r\n"Tak sa rozprávajte."\n', 140, 3.64, 50),
	(11085, 'Telefonujú si dve priateľky:\r\n“Ty si hovorila, že máš rada vtáčie mlieko.”\r\n“Áno. Prečo sa pýtaš?”\r\n“Tak príď ku mne. Mám tu dvoch sokolíkov.”\n', 170, 3.5, 50),
	(11086, 'Príde Róm do drogérie a hovorí:\r\n- Dyk, máte tu vôňu, čo sa volá ako ja?\r\nPredavačka sa na neho prekvapene pozrie a pýta sa ho:\r\n- Vy sa snáď voláte Christian Dior?\r\nA Róm odpovie:\r\n- Ne, ja som Dežo Dorant.              ', 237, 3.71, 50),
	(11087, 'Príde občan na vietnamský trh a pýta sa:\r\n- Nemáte tepláky, ktoré majú len 3 pásky Adidas?\r\n- Nie, mi nemat, ale to nevadit, čím viac pásik, tým lepší Adidas!              ', 187, 3.25, 50),
	(11088, 'Sedliakovi najprv umrie koza, potom krava, prasa a nakoniec aj manželka. Zničený a nešťastný sedliak si sadne na roľu a bedáka:\r\n- Panebože, čo som ti urobil, že ma takto trestáš???\r\nZjaví sa Boh, škrabe sa na brade a vraví:\r\n- Ja ti ani neviem, ty ma skrátka nejako serieš.              ', 306, 3.56, 50),
	(11089, '- Ako sa voláš?\r\n- Ró-ró-bert.\r\n- Ty sa zajakávaš?\r\n- Nie, ale pán farár, čo ma krstil.              ', 110, 3.64, 50),
	(11090, '- Ako spoznáte majiteľa mobilného telefónu?\r\n- Odstáva mu už iba jedno ucho.              ', 96, 3.91, 50),
	(11091, '- Akosi sa mi nechce ísť na návštevu k tým Horákovcom... hovorí muž žene.\r\n- Mne sa tiež nechce, priznáva sa manželka, - ale keď si predstavím ich radosť, keď neprídeme, tak radšej pôjdeme...              ', 224, 4, 50),
	(11092, '- Pán čašník, na ten rezeň čakám už hodinu!\r\n- Nebojte sa, máme otvorené až do rána!              ', 110, 3.42, 50),
	(11093, '- Haló, tu telefónna ústredňa, nemáte zaplatené poplatky za dva mesiace.\r\n- To musí byť nejaký omyl. Veď ja nemám ani telefón...              ', 154, 3.36, 50),
	(11094, '- Janíčko, nepi z tej jelenej stupaje, zmeníš sa na jeleňa...\r\n- Ha! Imidž je nanič, počúvam smäd!              ', 122, 3.5, 50),
	(11095, 'Viete, prečo sme najnezávislejšia krajina v Európe?\r\nLebo od nás nič nezávisí.              ', 100, 3.33, 50),
	(11096, 'Mama, mne sa dnes do práce vôbec nechce ísť, nikto ma nemá rád. Chlapi mi nadávajú, ženy sa mi posmievajú, deti mi vyplazujú jazyk... ja tam nepôjdem!\r\n- Ale nekecaj, už si raz predsedom vlády, tak tam musíš ísť !\n', 232, 4.09, 50),
	(11097, 'Po výpadku elektriny si dvaja rozprávajú zážitky:\r\n- Predstav si, chytilo ma to akurát vo výťahu, a tak som tam dve hodiny len tak sedel.\r\n- To máš ešte fajn. Ja som po celú dobu stál na eskalátore.              ', 226, 3.63, 50),
	(11098, 'Dvaja koktaví pracujú pri velikánskom lise a z kovových hranolov vyrábajú lopaty. Raz jeden z nich povie: "T-t-t-ty, p-po-počuj, s-s-s-kúsme u-u-urobiť krompáč. Ja po-poviem Š-Š-Š-TART, ty to p-p-pu-pustíš, a keď po-po-poviem D-DOSŤ, t-t-tak to zastavíš. Tak Š-ŠTART!......A D-D-D-DO-DO-DDO do riti, z-z-zase lopata!"              ', 353, 3.8, 50),
	(11099, 'Príde česká turistka na salaš a pýta sa baču: "Pane báčo, a vejce máte?" "No, mám, čo by nie..."A kolik?" "Kolík mám tiež..."\n', 140, 4.14, 50),
	(11100, '„Pán vrchný, prineste mi, prosím, trochu vody." \r\n„Ako si želáte, ale má to byť káva alebo polievka?"              ', 127, 4, 50),
	(11101, 'Podnikateľ príde k lekárovi a ten mu hovorí:\r\n- Vyzlečte sa.\r\n- Celkom?\r\n- Áno.\r\n- Aj mobil???              ', 114, 3.75, 50),
	(11102, 'V Bratislave na stanici sa dobýva Pražák na WC. Zúrivo búcha na dvere a volá: \r\n"Je tam někdo, je tam někdo?!" \r\nA zo záchodu sa ozve flegmaticky: \r\n"Kto by tu jedol, tuná sa serie!"              ', 206, 4.2, 50),
	(11103, 'Bača zaspáva v kolibe, keď v tom začuje, ako naňho niekto z vonku kričí:\r\n- Bačááá!\r\n- No, čo je!\r\n- Bačááá, potrebujete drevo?\r\n- Nie! Mám ho predsa dosť!\r\nRáno sa bača prebudí, výjde na dvor a pozerá:\r\n- Kurňa, kde je moje drevo?!!!\n', 259, 3.64, 50),
	(11104, 'Dežo a Gejza kradnú v záhrade ovocie. Prichytí ich záhradník a privedie ich k majiteľovi záhrady:\r\n- Za trest im napchajte do zadku to, čo nakradli!\r\nKeďže Dežo kradol slivky, tak mu ich pchajú do zadku a on sa pritom strašne smeje.\r\n- Tak tebe je to smiešne? pýta sa ho záhradník.\r\n- Je, lebo Gejza kradol melóny!              ', 347, 3.82, 50),
	(11105, 'Viete, v akej dobe žijeme?\r\nV elektrickej.\r\nDo práce chodíme s odporom, v zamestnaní sedíme v napätí a keď sa dotkneme vedenia, kopne nás do zadku.              ', 170, 4.23, 50),
	(11106, 'Viete, čo sa stane, keď skrížite prasa a včelu?\r\n- ???\r\n- Malý slovenský človek. Pracovitý, ale sviňa.              ', 126, 3.33, 50),
	(11107, 'Príde chlapík do baru a objedná si tri vodky a jedno deci sódy. Barman ho obslúži, chlapík vypije sódu a tri poldecáky vodky naleje do decového pohára. Barman s údivom hovorí:\r\n- Jéj, vy ste kúzelník?\r\nZákazník vyťahuje preukaz:\r\n- Nie, Slovenská obchodná inšpekcia.                                               \n', 336, 4.22, 50),
	(11108, 'Prečo sa ľudia hlásia na vysokú školu?\r\nAby dostali intrák a prístup na Internet.\n', 89, 3.43, 50),
	(11109, '"Mesiac je dôležitejší, než Slnko. Svieti, keď je tma."\n', 62, 3.3, 50),
	(11110, '"Dobrý deň, to je rádio? Ja som dnes našla peňaženku. A bolo v nej sto tisíc korún. A 340 mariek. A 108 dolárov. A bol tam i lístok s adresou. Miloš Novák, Konevova 8, Bratislava. Zahrajte mu prosím pesničku..."\n', 226, 4.09, 50),
	(11111, 'Bratislavčan sa vráti z dovolenky v Tatrách a hovorí svojim kamošom:\r\n"Predstavte si, že v tých Tatrách majú vzduch, čo nie je vidieť."\n', 147, 3.84, 50),
	(11112, 'Prídu turisti na salaš a pýtajú sa:\r\n"Bača, máte syr?"\r\n"Mám, ale nedám."\r\n"Bača, a mlieko máte?"\r\n"Mám, ale nedám."\r\nTuristi sklamane odídu. \r\nKeď už sú dole, objaví sa bača a volá:\r\n"Vráťte sa, vráťte sa!"\r\nTuristi sa zaradujú a driapajú sa hore svahom. Keď dolezú bača vraví:\r\n"Aj tvaroh mám, ale nedám."\n', 339, 4, 50),
	(11113, 'Ide chlap na bicykli a sused naň volá:\r\n"Hej, klepe ti blatník."\r\n"Čo?"\r\n"Klepe ti blatník!"\r\n"Čože?"\r\n"Klepe ti blatník!!"\r\n"Čo? Ja ťa nepočujem, klepe mi blatník!"\n', 178, 3.73, 50),
	(11114, '"Bol som v Tatrách. Tam bola super ozvena! Raz som zavolal\r\n\'haló\' a ozvalo sa to päťkrát!"\r\n"U nás v paneláku stačí raz kýchnuť, a ozve sa 10 ráz \'Na zdravie\'!"\n', 174, 3.3, 50),
	(11115, 'Chlapček, je doma ocko?"\r\n"Nie je."\r\n"A kedy sa vráti?"\r\n"Keď sa vraj bude dobre chovať, takže asi za desať rokov."\n', 122, 4, 50),
	(11116, 'Čo je to? Nepije to, neje to a aj tak to rastie.\r\nCeny!\n', 57, 3.8, 50),
	(11117, 'Volajú bačovia z kopca na kopec:\r\n"Jano!"\r\n"Čo je?"\r\n"Vieš to?"\r\n"A čo?"\r\n"Rusi letia na mesiac!"\r\n"A všetci???"\n', 119, 4, 50),
	(11118, 'Náš pionier nadviazal korešpondenciu s africkým pionierom. \r\nAfričan napísal:\r\n"Máme sa dobre. Sú prázdniny, celý deň sa kúpeme, jeme banány a chodíme bosí."\r\nNáš pionier mu odpovedal:\r\n"Aj my sa máme dobre. Tiež máme prázdniny, tiež sa kúpeme, a keby sme celý deň jedli banány, tiež by sme chodili bosí."\n', 334, 3.82, 50),
	(11119, 'Na ministerstvo príde pán Novák a pýta sa na vrátnici:\r\n"Mohol by ste mi povedať, koľko tu asi robí ľudí?"\r\n"No, povedal by som, že necelá polovica."\n', 162, 4, 50),
	(11120, 'Viete, aký je rozdiel medzi slovenskou korunou a americkým dolárom?\r\nJeden americký dolár.\n', 96, 3.82, 50),
	(11121, 'Čo je jašterička?\r\nKrokodíl, ktorý prežil hospodársky zázrak na Slovensku.\n', 83, 3.22, 50),
	(11122, 'Príde pán do železiarstva a pýta sa:\r\n"Dobrý deň, máte nejaký dobrý bezpečnostný zámok."\r\n"Nemáme."\r\n"Hmm... tak nejaký obyčajný bezpečnostný zámok?"\r\n"Nemáme!"\r\n"A čo tak obyčajný zámok?"\r\n"Nemáme!"\r\n"Tak prečo vlastne máte otvorené???"\r\n"No nemáme zámok."\n', 288, 2.91, 50),
	(11123, 'Z kuchyne prichádza čašník a úslužne sa klania pred hosťom:\r\n"Nesiem vám radostnú správu, pane! Mal ste úplnú pravdu. Nebola to polievka, bola to voda na riad!"\n', 173, 3.95, 50),
	(11124, '"Čo by ste mi mohol odporučiť, pán krčmár?" pýta sa hosť pozerajúc do jedálneho lístku v lacnej krčme.\r\nKrčmár odpovie úprimne:\r\n"Trpezlivosť a dobré trávenie!"\n', 179, 3.86, 50),
	(11125, 'Hosť sa pýta:\r\n"Pán vrchný, keď niekto nemá peniaze na zaplatenie, čo s ním urobíte?"\r\n"Vyhodím ho na ulicu."\r\n"Tak ma, prosím, vyhoďte."\n', 150, 4.08, 50),
	(11126, 'Do preplneného vlaku nastúpi mladík. Vojde do kupé, všetky miesta sú obsadené, ale na zemi má jedna babička položenú veľkú tašku. \r\n"Babička, mohol by som si sadnúť aspoň na tú vašu tašku?"\r\n"Kľudne, chlapče, ale hlavne daj pozor na vajcia."\r\n"Čo? Vy v tej taške máte vajcia?"\r\n"Nie, klince!"\n', 319, 4.21, 50),
	(11127, 'Jano spadol do šachty, kolegovia naňho kričia:\r\n- Si tam?\r\n- Som!\r\n- A stalo sa ti niečo?\r\n- Neviem, ešte letím!              ', 132, 4.09, 50),
	(11128, 'Do horehronskej krčmy vojde chlapík a kričí:\r\n"Chipsy a Coca-Colu, nevadí, že hovorím po anglicky?"              ', 120, 3.5, 50),
	(11129, 'Dvaja chlapi pília veľkou pílou strašne hrubý strom:\r\n- Jožoooo, aj tebe ide tak ťažko?\r\n- Neviem, ja teraz fajčím...               ', 142, 4.14, 50),
	(11130, 'Rozzurený mužský hlas telefonuje do hydrometeorologického ústavu: \r\n"Vy amatéri, už dva dni vynášam z pivnice v kýbloch to vaše polooblačno!!!"              ', 169, 4.23, 50),
	(11131, 'V tatranskej doline poľskí turisti slovenským horolezcom: \r\n"Do scany, do scany?"\r\n"Nie, to sme len takí spotení..."              ', 135, 4.11, 50),
	(11132, 'Vyšetruje Mara pred spaním Fera:\r\n- Bránu si zavrel?\r\n- Zavrel! - odvetí Fero.\r\n- A špajzu si zavrel?\r\n- Zavrel!\r\n- A dvere na kuchyni si zavrel?\r\n- Vieš co, daj už pokoj! Okrem tvojej huby je už všetko pozatvárané!...\r\n- uzavrie problém Fero.              ', 269, 3.8, 50),
	(11133, 'Hovorí opatrne Mara Dore:\r\nNič ma do toho nie je, Dorka, ale všimla si si, že tvoja dcéra začala usilovne pliesť detské hábočky. Samozrejme, že som si to všimla. A vieš ako som rada, že tá potvora začala robiť aj niečo užitočnejšie, ako len večne behať za chlapmi...              ', 303, 4, 50),
	(11134, 'Rozprávajú sa dvaja kamaráti:\r\n- Ešte šťastie, že nie som vták, to by bolo o ničom.\r\n- Prečo?\r\n- Neviem lietať...\n', 125, 3.92, 50),
	(11135, 'Pribehne syn za otcom:\r\n- Oci, oci! Čo je to bumerang?\r\n- Hmm, bumerang, to je také, že keď to hodíš a nevráti sa ti to, tak to nebol bumerang...\n', 153, 4.08, 50),
	(11136, 'Mladík prišiel za otcom svojej milej a vraví:\r\n- Prosím vás o ruku vašej dcéry, ak nemáte nič proti.\r\n- Naopak. Zoberte si tú, ktorá stále lezie do mojej peňaženky.\n', 179, 3.8, 50),
	(11137, 'Mladé pekné dievča si kupuje plavky. Predavačka sa jej pýta:\r\nAké by mali byť? Chcete na dovolenke niečo príjemné zažiť, alebo si chcete oddýchnuť?              ', 175, 3.46, 50),
	(11138, 'Slečna je na nákupe v supermarkete a kupuje si:\r\n1 mydlo\r\n1 zubnú kefku\r\n1 zubnú pastu\r\n1 bagetu\r\n1 liter mlieka\r\n1 jablko\r\n1 banán\r\n1 pomaranč\r\n1 broskyňu\r\n1 paradajku\r\n1 kapustu\r\n1 tyčinku müesli\r\n1 koláč\r\n1 večeru do mikrovlnky\r\n1 mrazenú pizzu\r\nPokladník sa na ňu pozrie a hovorí jej: “Vy ste sama, že?”\r\nSlečna sa zahanbene usmeje a odpovie rozochveným hláskom: “Áno, ako ste na to prišli?” Pokladník odpovie: “Ste totiž strašne škaredá.” \n', 484, 3.95, 50),
	(11139, 'Dvaja poľovníci si rozprávajú zážitky:\r\n- Nedávno, v Afrike, zo vzdialenosti 500 metrov som jedinou strelou zabil slona.\r\n- Ja som zas pri kúpaní sa v oceáne holými rukami zahrdúsil veľrybu.\r\n- A počuli ste o Mŕtvom mori? Keby nie ja, ešte by žilo...\n', 268, 3.95, 50),
	(11140, 'Manžel ide do práce a hovorí manželke:\r\n“Nohavice si mi vyčistila?“\r\n“Áno, drahý.“\r\n“A sako?“\r\n“Áno, drahý.“\r\n“A topánky?“\r\n“Aj tam máš vrecká?“\n', 182, 4, 50),
	(11141, 'Matka sa pýta dcéry:\r\n- Čo je zač, ten tvoj nový priateľ? Je to poriadny človek?\r\n- Samozrejme, mami, je veľmi šetrný, nefajčí, nepije a má moc milú ženu a tri rozkošné deti...              ', 207, 3.88, 50),
	(11142, 'Muž býva na siedmom poschodí. Raz v noci sa vracia z krčmy vo veľmi dobrej nálade a sťažuje sa manželke:\r\n- Predstav si, drahá, že som tých sedem poschodí musel vyšliapať pešo.\r\n- A prečo si si neprivolal výťah?\r\n- Privolal, na každom poschodí, ale zakaždým z neho vybehol niekto v pyžame a ukrutne mi vynadal.              ', 348, 4.12, 50),
	(11143, '“Na Silvestra sme mali takú psinu, až sme sa za bruchá chytali.“\r\n“No, aj nám bolo tak zle, ale z husaciny!“\n', 121, 3.58, 50),
	(11144, 'Stretnú sa dve známe:\r\n- S kým si strávila  včerajší večer?\r\n- Bola som sama.\r\n- To je hrozné! Nevedela si si nájsť lepšiu spoločnosť?              ', 162, 4, 50),
	(11145, 'V reštaurácii:\r\n- Pán hlavný, prosím si sviečkovú tak, ako zvyčajne. A nie, aby ste mi ju priniesli skôr ako inokedy. \r\n- A to už prečo? \r\n- Zubár mi zakázal dve hodiny jesť.              ', 202, 3.92, 50),
	(11146, 'V reštaurácii:\r\n- Pán vrchný, čo to pláva v tej mojej polievke?\r\n- Ako sa tak pozerám, tak nič...\r\n- No vidíte! A mali tam byť rezance!              ', 159, 4.1, 50),
	(11147, 'V penzióne sa sťažuje hosť:\r\n- V izbe mám len jeden vodovodný kohútik! Prečo ste v prospekte uviedli teplá aj studená voda?\r\n- Pretože na umývanie je tá voda studená a na pitie teplá.              ', 212, 4, 50),
	(11148, 'Dvaja páni idú vo výťahu. Jeden si prdne a druhý sa pýta:\r\n“Pane, vy ste si prdli?“\r\n“Samozrejme, hádam si nemyslíte, že takto smrdím celý deň!“\n', 165, 4.18, 50),
	(11149, '"Pil som u vás už aj lepšiu kávu..."\r\n"U nás? Vylúčené!"              ', 78, 4.16, 50),
	(11150, 'Pred odchodom na vojnu prehovára otec synovi do duše:\r\n”Keď budeš na tej vojne, nie aby si sa zaplietol s nejakou ženskou. Vieš, aké tam sú. Nakazí teba, ty nakazíš svoju priateľku, tá zase mňa, ja tvoju matku ... a vieš, aká je tvoja matka - tá nakazí celú dedinu.”              ', 303, 4.17, 50),
	(11151, 'Mladík si to rozdával doma s nejakým dievčaťom, keď sa neočakávane vrátili jeho rodičia.\r\nČo si kto pomyslel, keď sa otvorili dvere:\r\nOn: Hneď som hovoril, že máme ešte počkať.\r\nOna: Teraz si ma už určite vezme.\r\nOtec: Aleže podrástol, chlapec. Možno už je čas kúpiť mu aj motorku.\r\nMatka: Ako to pod ním leží?! Veď mu to, chudáčikovi, musí byť strašne nepohodlné!              ', 415, 3.33, 50),
	(11152, 'Ide babka z domu a spomenie si, že nevypla sporák. Tak sa začne modliť:\r\n”Anjeličku, môj strážničku, opatruj moju dvojplatničku a prepni paličku zo šestky na jedničku.”              ', 199, 3.36, 50),
	(11153, 'Príde do banky starší chlapík, sadne si k okienku a vraví:\r\n- Chcem si otvoriť účet.\r\n- A aký typ účtu máte konkrétne na mysli?\r\n- Do riti, to je jedno, proste účet.\r\n- Prosím, pane? Hádam som zle počula...\r\n- Vravel som, do riti, to je jedno, proste akýkoľvek zasratý účet.\r\n- Pane, takéto výrazy sú tu neprístojné!\r\nKonverzácia ešte chvíľu pokračuje, až úradníčke za okienkom dôjde trpezlivosť a zavolá manažéra. Ten sa s ňou vráti k okienku a vraví:\r\n- Tak, čo to tu máme za problém?\r\n- Vyhral som v zasratej lotérii posratých päťdesiat miliónov a chcem si otvoriť jeden zasratý účet!\r\n- Ach táák. A táto stará krava vám chce pokaziť deň, že?              ', 724, 4.29, 50),
	(11154, 'Sedia v krčme Japonec, Američan, Angličan, Francúz a Slovák. Japonec napľuje na Američana a ten mu hovorí: \r\n- To si posral, ideme von! Zvonku je počuť bum, prásk, tresk, vráti sa Japonec a vraví: \r\n- To bolo karate. Od nás. \r\nJaponec napľuje na Angličana a ten vraví: \r\n- To si posral, ideme von! \r\nZvonku počuť bum, rach, tresk, vráti sa Japonec: \r\n- To bolo kendo. Tiež od nás. \r\nPotom napľuje na Francúza a idú von. \r\nZvonku zasa počuť: bum, bác, prásk, vráti sa Japonec a hovorí: \r\n- To bolo džudo. Tiež od nás. \r\nKeď napľuje na Slováka, ten hovorí:  \r\n- To si posral, ideme von. \r\nZvonku počuť jediné tresk! \r\nVráti sa Slovák a hovorí: \r\n- To bol hever z Mazdy. Tiež od nich.              ', 740, 4.15, 50),
	(11155, '\r\nPriemerný plat Američana je 6 000 dolárov. Za stravu, nájomné, elektrinu, plyn a vodu, kultúru, benzín a ostatné nevyhnutné náklady vydá mesačne približne 4 000 dolárov. Čo urobí s tými 2 000 dolármi, o to sa vláda nestará.\r\nPriemerný plat Nemca je 4 000 mariek. Za stravu, nájomné, elektrinu, plyn a vodu, kultúru, benzín a ostatné nevyhnutné náklady vydá mesačne približne 2 500 mariek. Čo urobí s tými 1 500 markami, o to sa vláda nestará.\r\nPriemerný plat Slováka je 9 000 korún. Za stravu, nájomné, elektrinu, plyn a vodu, kultúru, benzín a ostatné nevyhnutné náklady vydá mesačne približne 11 000 korún. Kde zoberie tých 2 000 korún, o to sa vláda nestará.\n', 718, 3.8, 50),
	(11156, 'Chlapík lezie po skalách a zrazu, akurát v polovičke jedného náročného úseku mu prasklo lano. Zostal visieť za končeky prstov v úplne bezvýchodiskovej situácii. Pred očami mu prebehol celý život a on v náhlom zúfalstve obrátil oči k nebu a zvolal:\r\n- Je tam hore niekto?\r\nA zhora zahrmel mocný hlas:\r\n- Áno, som tu!\r\n- Kto ste?\r\n- Som Boh, kto by som bol.\r\n- Prosím, Bože, pomôž mi.\r\n- Pomôžem ti, pusť sa.\r\n- Čože?\r\n- Ver mi, pusť sa a ja ti pomôžem.\r\nChlapík chvíľu pozeral do neba a potom zvolal:\r\n- Je tam hore ešte niekto???\n', 569, 3.87, 50),
	(11157, 'Sedí bača pred kolibou, prídu turisti a pýtajú sa:\r\n- Bača, syr máš?\r\n- Mám, ale nedám.\r\n- Hm, bača a mlieko máš?\r\n- Mám, ale nedám.\r\n- Bača, žincicu máš?\r\n- Mám, ale nedám.\r\nTak turisti sa sklamane otočia a lezú z kopca dole do dediny. Keď už sú skoro dole, objaví sa nad nimi na stráni bača a volá:\r\n- Vráťte sa, vráťte sa!\r\nTuristi sa zaradujú, že si to bača predsa len rozmyslel a zase sa driapú svahom hore. Keď prídu ku kolibe, sedí tam bača, vyberie fajku z úst a vraví:\r\n- Aj tvaroh mám, ale nedám.\n', 553, 4.22, 50),
	(11158, 'Ide bohatý muž s bavorákom po ceste a zrazu ho obieha babeta. Muž sa začuduje a dupne na plyn, no babeta ho zase predbieha,. \r\nto čo je toto?pýta sa muž a poriadne na to šliapne. keď ho babeta zase obieha, už zakričí:\r\nhej , človeče, čo tam máš, motor z rakety alebo čo?\r\nčo by, veď ty si mi na pumpe privrel traky do dverí!', 346, 3.45, 50),
	(11159, 'Išiel jeden ocko so synčekom nakupovať a zastavili pri stroji čo predpovedá kde čo je ocko zastaví a vraví: synček ja sa skryjem za stenu a ty sa spýtaj, kde som. Synček odpovedá: dobre. Synček ide ku stroju a pýta sa: kde je môj ocko? Stroj odpovedá:v afrike, ale nehovor to tomu blbcovi čo stojí za stenou\r\n', 327, 3.68, 50),
	(11160, '"Mamička, prečo staviaš ten vianočný stromček už v máji?" \r\n"Pretože, nám ty malý tuberáčik, už asi do vianoc nevydržíš!" \r\n', 141, 3.2, 50),
	(11161, 'Kefka po umytí zubov hovorí: "Ja mám tú najhoršiu prácu..." \r\nMeter od nej je toaletný papier a ten jej hovorí: "Myslíš...?" ', 135, 3.96, 50),
	(11162, 'Príde babka do spovednice a hovorí: "Joj, do riti, tu je ale tma." Začuje ju farár a povie jej: "Počúvajte babka, v kostole sa nehreší." "Hej ty debil, ale keď ja som  sa tak veľmi zľakla." ', 201, 3.16, 50),
	(11163, 'Janko kričí na maminku z obývačky: "Mami, mami, stromček horí."A maminka ho upozorňuje: "Hovorí sa svieti, nie horí." O chvíľu na to Janko kričí: "Mami, mami, záclony už tiež svietia."', 200, 4, 50),
	(11164, '- Mami, v škole sa mi posmievajú, že mám dlhý krk.\r\n- Nevšímaj si ich, ale choď sa pozrieť cez komín, či už ide otecko.', 131, 2.96, 50),
	(11165, 'Ide tučná babka po ulici a hovorí si: "Joj, keby som bola jahôdkou.."Jeden z okoloidúcich jej hovorí: "Hm, to by bolo džemu." ', 133, 3.88, 50),
	(11166, 'Najlepšia investícia je do Borovičky!\rIstých 40%.', 53, 3.46, 50),
	(11167, 'Babka z dedkom pekne žili, chalúpku si postavili. Dedko prdol ako strela, chalúpka sa rozletela. Babka prdla ešte viac,vyletela na mesiac. Mesiac bol opitý, kopol babku do riti. Babka mu to vrátila, podprsenku stratila.', 225, 2.46, 50),
	(11168, 'Úspešné zavedenie eura STOP plyn  STOP  ropa STOP', 52, 2.96, 50),
	(11169, 'Otec hovorí synovi: "Jano ty si taký dutý ako toto dubové drevo" a zaklope na stôl.\r\nA syn odpovedá: "Ticho otec, niekto klope!"', 134, 3.06, 50),
	(11170, 'Slováci sa podľa spoločenského postavenia rozdeľujú na 3 skupiny:\r\n1. Tí, čo chodia na ples v opere.\r\n2. Tí čo chodia na ples do kulturáku.\r\n3. Tí, čo chodia do krčmy. ', 182, 3.44, 50),
	(11171, 'Ide Pedro s manželkou na kobyle, keď v tom kobyla zakopne.\r\nPedro:\r\n"Tak to bolo po prvý raz..."\r\nIdú ďalej a kobyla zakopne zase.\r\nPedro:\r\n"Tak to bolo po druhý raz..."\r\nPo chvíli stará kobyla zase zakopne.\r\nPedro:\r\n"Tak to bolo po tretí raz..." ... a vytiahne búchačku a kobylu zastrelí. Manželka:\r\n"Pedro, ty si úplný dilino, čo si to urobil, ako teraz pôjdeme ďalej, keď je kobyla mŕtva, čo budeme robiť, ty blbec.....?!"\r\nPedro:\r\n"Tak to bolo po prvý raz..."\n', 487, 2.97, 51),
	(11172, '"Mamička, môžem sa večer dívať na Troch mušketierov?"\r\n"Nie, Zuzka, na Troch mušketierov si ešte malá."\r\n"Tak ja sa budem dívať aspoň na jedného, dobre?"              ', 181, 4.07, 51),
	(11173, 'Biblia učí miluj blížneho svojho. \r\nKámasutra zase vysvetľuje ako.              ', 86, 3.65, 51),
	(11174, 'Policajtka zastaví podnapitého vodiča a hovorí mu:\r\n"Ste zatknutý. Čokoľvek od tejto chvíle poviete, bude použité proti vám!"\r\nOpilec celý nadržaný hovorí:\r\n"Vaše kozy!"              ', 199, 4.15, 51),
	(11175, 'Kúpu sa dve brontosaurice a na brehu vidia kamarátku. Hovoria jej:\r\n"Poď sa s nami okúpať, voda je skvelá."\r\n"Keď ja nemôžem, vieš, mám svoje dni."\r\n"Čože??? Ty nepoužívaš ovce?"              ', 208, 3.96, 51),
	(11176, 'Príde zlodej v noci do domu a počuje papagája ako mu vraví: \r\n"Ferri, ťa vidí, Ferri ťa vidí."\r\nZlodej vezme deku zakryje klietku \r\na papagáj znova škrieka:\r\n"Ferri, nie je papagáj, Ferri je pidbul."\n', 211, 4.13, 51),
	(11177, 'Čašník sa pýta hosťa:\r\n"Máte prázdny pohárik, mám vám priniesť ďalší?"\r\n"A čo budem robiť s dvoma prázdnymi pohármi?"              ', 149, 4.02, 51),
	(11178, 'Barman sleduje hosťa, ktorý vypil pohár koňaku, potom si niekoľkokrát odhryzol z pohára a sklo pohrýzol. Z pohára ostala len stopka.\r\n"Videli ste už niekedy niečo také?"  pýta sa užasnutý barman iného hosťa.\r\n"Veru nie. Chumaj, to najlepšie nechal..."              ', 283, 3.93, 51),
	(11179, 'Chlapec stretol mníšku a chcel sa jej opýtať koľko je hodín. Nevedel ako ju osloviť, tak sa pýta:\r\n- Pán farár-samička, neviete náhodou koľko je hodín?              ', 179, 4.03, 51),
	(11180, 'Viete prečo Boh miluje ateistov?\r\nNeobťažujú ho svojimi problémami.              ', 86, 3.49, 51),
	(11181, 'Príde chlap do kostola a už od vchodu kričí:\r\n"Poďte všetci do krčmy, všetkých Vás pozývam."\r\nZrazu sa otvoria dvere na spovedeľnici, z ktorej vystrčí hlavu farár aby spozoroval čo sa deje. Chlap na to:\r\n"A ty až dotlačíš, tak príď za nami."              ', 277, 3.84, 51),
	(11182, 'Chlapec po prvý krát navarí frajerke obed. Počas hlavného chodu sa frajerka spýta:\r\n- To mäso je z konzervy, zlatko?\r\n- Áno, miláčik. Bol tam nápis "pre vášho miláčika" a vedľa toho taky chutný psík.              ', 231, 3.94, 51),
	(11183, 'Jedno veľmi škaredé dievča chce ísť na maškarný bál, ale nevie, za čo by mala ísť. Tak si len napchá tvaroh do úst a ide. Na maškarnom bále sa jej pýtajú:\r\n- A ty si za čo?\r\nDievča si stisne líca a hovorí:\r\n- Ja som tu za jebák.              ', 265, 3.88, 51),
	(11184, 'Pridu policajti za podozrivym. A klopu na dvere a z poza dvery sa ozve clovek. Kto je? policia otvorte. A co chcete? chceme sa porzpravat. A kolko vas je? Dvaja. Tak sa porozpravajte.              ', 197, 3.78, 51),
	(11185, 'Starší pán sa rozplýva nad kočíkom:\r\n- Och bože, aké krásne dieťa. A aké má krásne veľké očičká.\r\n- To áno, hovorí pyšný otec. A čím viac pritiahnem šál, tým sú väčšie.              ', 213, 3.89, 51),
	(11186, 'Pacient hovorí psychiatrovi:\r\n- Pán doktor, ja mám radšej silónové ponožky ako bavlnené.\r\n- Aj ja mám radšej silónové - hovorí psychiater.\r\nA pacient nato:\r\n- A máte ich radšej s jahodovým džemom, alebo slivkovým ako ja?              ', 252, 3.28, 51),
	(11187, '-Babička, prečo sa Zem krúti?\r\n-Ej, ty nezbedník, zase si si upil z dedkovho koňaku?!              ', 104, 4.17, 51),
	(11188, 'Traja králi sa prídu pozrieť do Betlehéma na Jezuliatko. \r\nAko ho tak obzerajú, jeden z nich vraví: \r\n"Ježišikriste, ten je ale krásny." \r\nJozef sa buchne po čele a vraví Márii: \r\n"Vidíš, to je meno a nie Hugo!"              ', 239, 3.63, 51),
	(11189, 'Mladík bol prvý raz na návšteve u slečny a ako si to spolu užívali, prišlo na neho nutkanie na záchod. Dievčina mu ukázala smer, ale ejha! Na chodbe sedel ohromný hafan a jeho pohľad vôbec nebol prívetivý. Ale nutkanie bolo silné a tak dostal náš mladík spásny nápad: "Urobí to na chodbe a zvalí to na psa. Už bol skoro hotový, keď zo spálne na neho kričí:\r\n"Kde si tak dlho? Už si hotový?"\r\n"Ešte som sa ani nedostal na WC. \r\nNa chodbe leží nejaké psisko!"\r\n"Toho sa neboj. Ten je plyšový."              ', 543, 4.15, 51),
	(11190, 'Dámy a páni, hovorí k vám kapitán. Práve sa nachádzate na palube najväčšieho lietadla na svete. Na tomto poschodí nájdete bar a reštauráciu, na druhom bazén a tenisové kurty. \r\nNa treťom poschodí si môžete spríjemniť let návštevou kina a divadla. No a teraz mi držte palce, ja sa to hovädo pokúsim dostať do vzduchu."              ', 359, 4.27, 51),
	(11191, 'Policajt zastaví auto a hovorí vodičovi:\r\n"Gratulujem vám, vyhrali ste odmenu 500 dolárov, lebo ste prvý vodič, ktorý mal dnes večer zapnutý pás."\r\n"To vám veľmi pekne ďakujem, konečne si budem môcť urobiť vodičský preukaz."\r\nVedľa neho sedí jeho žena:\r\n"Ale no. Viete, on vždy tára, keď má vypité."\r\nZozadu sa ozve hlas:\r\n"Ja som vám to hovoril, že nás cez hranice bez pasu nepustia."\r\nA z kufra sa ozve hlas:\r\n"My už byť v Mexiko?"              ', 480, 4.13, 51),
	(11192, 'Dvaja kozmonauti stoja pred raketoplánom na mesiaci. Jeden pozrie na druhého a hovorí:\r\n"No na mňa nepozeraj, ja som nezamykal!"              ', 146, 3.35, 51),
	(11193, 'Pýta sa turista baču:\r\n"Bača, máte pekný kožuch. Odkiaľ ho máte?"\r\n"Jáj, to mám od partizánov."\r\n"Bača, počúvajte, dajte mi ho."\r\n"Hohohoó, sám si zastreľ!"              ', 187, 3.57, 51),
	(11194, '"Vážení hostia, nesadajte si, prosím, na tento diván. Je plný ploštíc."\r\n"Tak prečo ho nevyhodíte?"\r\n"Skúšal som, ale tie potvory ho zakaždým prinesú späť!"              ', 187, 3.59, 51),
	(11195, 'Stojí Káčer Donald pri sporáku, v ruke drží zápalku a hovorí si:\r\n"Vybuchne? Nevybuchne?"              ', 111, 3.46, 51),
	(11196, '"Sú dve čierne ceruzky a jedna farebná. Tá farebná je tehotná.  Od ktorej z tých dvoch asi?"\r\n"Od tej bez gumy."              ', 133, 3.53, 51),
	(11197, 'Sedia na streche dve dievčatká. Jedno dobré a druhé zlé. Pľujú na okoloidúcich. Zlé dievčatko trafilo dva razy a dobré dievčatko štyri razy. A tak zase raz dobro zvíťazilo nad zlom!              ', 210, 4.02, 51),
	(11198, 'Obžalovaný na súde:\r\n"Bol som tam sám, nikto ma nevidel! Mám na to svedkov!"              ', 95, 4.2, 51),
	(11199, 'Slimák znásilní korytnačku a vyšetruje sa to celé pred súdom. Sudca sa pýta korytnačky:\r\n"Vysvetlite nám, ako sa to vlastne stalo?"\r\n"Ja ani neviem, ono sa to zomlelo tak rýchlo."              ', 204, 4.29, 51),
	(11200, 'V kláštore sa spovedá muž. Po chvíli začne nariekať:\r\n"Och, život je taký krutý, všade samé svinstvo, už sa to nedá vydržať!"\r\nKňaz na to:\r\n"Máte pravdu, sex, prostitúcia, drogy, zabíjanie, znásilnenia, pochybné kšefty... No, ale mimo kláštora to tiež nie je lepšie."              ', 308, 3.76, 51),
	(11201, 'K mužovi na ulici priskakujú traja zlodeji s nožmi v ruke a žiadajú od neho peniaze. Napadnutý nestratí hlavu a kričí:\r\n"Dajte si pozor! Ovládam džudo, karate, kung-fu!"\r\nZlodeji sa zľaknú a keď utekajú preč, dodá:\r\n"A ešte zopár japonských slov..."              ', 283, 3.13, 51),
	(11202, 'Stretnú sa 3 žraloky a rozprávajú si svoje zážitky.\r\nPrvý hovorí: \r\n"Nedávno som zožral jedného Američana a ten bol tak napchatý hamburgermi, že mi bolo týždeň nanič."\r\nDruhý na to:\r\n"To ja som nedávno zožral jedného Rusáka, ten bol tak napitý, že som nedokázal plávať rovno."\r\nA tretí hovorí:\r\n"To nič nie je, to ja som nedávno zožral českého policajta a ten bol taký dutý, že som sa nemohol týždeň potopiť!"              ', 465, 4.09, 51),
	(11203, 'Peter príde na družstvo a hovorí:\r\n"Predseda, ja som vašu dcéru Maru nó, hmmm, tóó..."\r\nPredseda na to:\r\n"Keď sa stalo, stalo sa. Teraz si ju však musíš zobrať za manželku."\r\n"Ój, to nie. Ja som ju prešiel traktorom!              ', 246, 4.21, 51),
	(11204, '"Haló? Prepáčte, je to číslo deväť, tri, štyri, tri, sedem, sedem, osem, päť, štyri?"\r\n"Nie, áno, nie, áno, áno, nie, nie, áno, nie."              ', 162, 3.91, 51),
	(11205, 'Stretli sa po rokoch dve kamarátky:\r\n"Ako sa máš?"\r\n"Som vydatá za námorníka, 11 mesiacov sa plaví po mori a na jeden mesiac chodí domov."\r\n"Tak to ťa teda ľutujem."\r\n"Nie je to až také hrozné, dva týždne z toho chodí na návštevu\r\nk rodičom."              ', 275, 4.22, 51),
	(11206, 'Hovorí šéf zamestnancovi:\r\n"Je mi veľmi ľúto, že ste dali výpoveď."\r\n"Naozaj?"\r\n"Áno. Tak som sa tešil, ako vás jedného dňa vyhodím."              ', 162, 3.79, 51),
	(11207, 'Smradľavý a otrhaný bufeťák si prisadne v parku na lavičku ku krásnej slečne. Chvíľku ju pozoruje a potom jej ponúkne z nedopitej fľaše piva.\r\n"Dajte mi pokoj s tým pivom!" pohoršuje sa slečna.\r\nBufeťák siahne do vrecka, vytiahne uváľaný, chlpmi polepený cukrík a ponúkne ho slečne.\r\n"Už som vám raz povedala, aby ste neotravovali!" zreve dievča.\r\nBufeťák pokýva hlavou a zamyslene prehodí:\r\n"Hmm, tak o sexe asi ani začínať nemusím..."\n', 473, 4, 51),
	(11208, 'Manželka po večeri umýva riady a kričí na svojho muža do obývačky:\r\n"Tak si predstav Ignác, že tá naša dcéra sa dala na šachy."\r\nMuž zdvihne oči od novín a hovorí:\r\n"To vážne? Ona a šach?"\r\n"Áno. Pred chvíľou volala, že ťahá na E55!"              ', 274, 4.08, 51),
	(11209, 'Pravé vajce hovorí ľavému:\r\n"Ide pekná baba."\r\n"Ako to vieš?"\r\n"Šéf sa postavil."              ', 103, 3.75, 51),
	(11210, 'Príde pán do drogérie:\r\n"Prosím si, jeden kabátik na chlapčeka!"\r\nPani vedúca mu podáva balíček primerosov so slovami:\r\n"Nech sa páči kabátik na chlapčeka!\r\nA pokiaľ by ste si prial naňho kožušinkový golierik, tak zatváram o šiestej!"              ', 269, 3.87, 51),
	(11211, 'Príde opilec do kostola a sadne si do spovedelnice. Farár zmätený, nevie čo má robiť, tak zakašle. Opilec nič, tak mu zaklope na okienko a opilec hovorí:\r\n"Darmo klopeš, ani tu nie je toaleťák."              ', 221, 3.75, 51),
	(11212, 'Sedia dvaja kamaráti v krčme. Jeden sa pýta druhého:\r\n"Počúvaj, kedy si mal búračku?"\r\n"Akú búračku?"\r\n"Len mi nehovor, že si sa s takým ksichtom narodil!"              ', 182, 4.08, 51),
	(11213, 'Sedí muž so ženou na predstavení Labutieho jazera. Žena sa nakloní k mužovi a pýta sa:\r\n"Prosím ťa, prečo tie ženy stále behajú po špičkách?"\r\n"No vieš, to je predstavenie o labutiach, určite je tam nasrané!"              ', 242, 4.11, 51),
	(11214, 'Pýta sa slepý bubeník hluchého gitaristu:\r\n"Už tancujú?"\r\n"Prečo? Už hráme?"              ', 99, 4, 51),
	(11215, 'Bača si vyjde do mesta a keď sa vracia, tak ho zastihne hrozná búrka. Je asi 100 m od salaša, keď blesk udrie do stáda ovcí a všetky zabije. Bača na to: "No toto!!"\r\nJe asi 50 m od salaša, keď blesk udrie do koliby a tá začne horieť.\r\nBača na to: "No toto!!"\r\nZ koliby vybehne bačova svokra a bác, blesk ju zabije...\r\nA bača na to: "No preto!!"              ', 377, 3.95, 51),
	(11216, 'Príde Slovák v Anglicku k zubárovi.\r\nSadne si do kresla a prstom ukáže na boľavý zub: "Tu!"\r\nZubár mu vytrhne dva zuby. Celý rozčúlený príde za svojim kamarátom a vraví mu:\r\n"Ukázal som na zub, povedal tu a ten blbec mi vytrhol dva zuby." \r\n"Vieš, tu znamená po anglicky dva, tak si musíš dávať pozor!" Chlapík poučený zo situácie príde na kontrolu k inému zubárovi, ukáže na ďalší boľavý zub: "Ten!"              ', 450, 4.16, 51),
	(11217, 'Beží uprostred noci klaun za riaditeľom cirkusu\r\n- Pán riaditeľ! Horí nám šapitó!\r\n- A čo? Hltač ohňa býva vo vedľajšej maringotke.              ', 160, 3.83, 51),
	(11218, 'Stojí tučný chlap pred škôlkou.\r\nUčiteľka sa ho pýta.\r\n"Čakáte dieťa?"\r\nPán na to.\r\n"Nie to mám od piva."              ', 132, 3.42, 51),
	(11219, 'Ide róm po púšti a keď je už na konci so svojimi silami, stretne tri víli. Tie mu ponúknu, že každá z nich mu splní jedno želanie. Róm celý rád odpovie: \r\n"Tak chcem byť biely, chcem sa lepiť na ženy a chcem vedieť lietať."\r\nA víli na to: "Čáry, máry hadia kožka, nech je s teba olveis vložka."              ', 334, 3.85, 51),
	(11220, 'Idú hovno s riťou do pivnice a hovno hovorí:\r\n"Je tu tma ako v riti."\r\nA riť na to:\r\n"Hmm, ja tiež hovno vidím."              ', 132, 4, 51),
	(11221, 'Nemecký turista je na salaši. Bača naňho kričí: "Pozor! Pes! Hryzie!"\r\n"Was? Was?"\r\nBača na to: "Čože mňa, ale vás!"              ', 141, 4.21, 51),
	(11222, 'V jedálnom vozni sa rozčuľuje cestujúci:\r\n"To je strašné, už sto kilometrov čakám na rezeň!"              ', 116, 4, 51),
	(11223, 'Princ Bajaja vraví drakovi:\r\n"Drak ty si pil! Dýchni na mňa"              ', 77, 3.5, 51),
	(11224, 'Príde Norbert do obchodu a predavač sa ho dotieravo pýta:\r\n"Čo to bude?"\r\n"Jednu žuvačku si prosím."\r\n"Jednu?"\r\n"Nie tisíc!"\r\n"Prepáčte, ale tisíc nemáme."\r\n"Tak čo strúhaš machra?"              ', 210, 4.23, 51),
	(11225, 'Čašník ponúka hosťovi:\r\n"Mám teľacie srdce, bravčovú pečeň, hovädzí jazyk, údené kolená, rybie prsty a volské oká..."\r\nHosť ho preruší:\r\n"Vaše problémy ma nezaujímajú, dal by som si guláš a pivo!"              ', 237, 4.07, 51),
	(11226, 'Mladomanželia po sobáši prišli do drahej reštaurácie. Pri hlavnom chode mladá pani hovorí:\r\n"Peter, toto mäso sa nedá požuť!"\r\n"Ale dá, drahá, dá... Iba si si zabudla zdvihnúť závoj..."              ', 217, 4.1, 51),
	(11227, 'Čašníci v staničnej reštaurácii s úžasom v očiach pozorujú, aké obrovské množstvá jedla skonzumuje drobný mužíček pri jednom stole. Jeden z nich to už nevydrží a opýta sa:\r\n"Ako je možné, pane, že taký malý človek ako vy, zje tak veľa?"\r\n"Viete, ja vnútri nie som taký malý, ako sa zdám vonku."              ', 341, 3, 51),
	(11228, '- Ako sa cítite v nových okuliaroch...\r\n- Výborne. Odrazu stretávam hŕbu známych s ktorými som sa nevidel už celé roky.              ', 142, 4.17, 51),
	(11229, 'Pilot: "Dobré ráno Bratislava."\r\nTower: "Dobré ráno. Pre informáciu - tu je Viedeň."\r\nPilot: "Chystáme sa na pristátie, Bratislava."\r\nTower: "Tu je naozaj Viedeň."\r\nPilot: "Viedeň?"\r\nTower: "Áno."\r\nPilot: "Ale prečo? My sme chceli do Bratislavy."\r\nTower: "O.K. Tak prestaňte pristávať\r\na zahnite doľava."\n', 321, 3.5, 51),
	(11230, 'Tower: "Ste Airbus 320 alebo 340?"\r\nPilot: "Samozrejme že Airbus 340."\r\nTower: "V tom prípade buďte tak láskavý a zapnite pred štartom aj tie dva ďalšie motory."              ', 183, 4, 51),
	(11231, 'Tower: "Aby sme zabránili hluku, uhnite prosím o 45 stupňov doprava."\r\nPilot: "Čo môžeme robiť za hluk v 35 000 stopách?"\r\nTower: "Taký rachot, ako keď vaša 707 narazí do 727 pred vami."              ', 212, 4, 51),
	(11232, '"Pán šofér, zastavte, Tamagočimu je zle!"\n', 46, 3.11, 51),
	(11233, '- Zdravím, sused. Ako sa máte?\r\n- Dajte mi pokoj. Ani ja sa nepýtam, s kým je vaša dcéra tehotná.              ', 118, 3.7, 51),
	(11234, 'Prechádzajú sa dvaja pacienti po dvore blázinca. Jeden zodvihne hlavu a hovorí:\r\n"Tam hore, to je slnko alebo mesiac?"\r\n"Neviem," odpovie druhý, "nie som tunajší."              ', 184, 3.9, 51),
	(11235, '- Dôstojný pane, často sa pred zrkadlom kochám, aká som krásna, je to veľký hriech?\r\n- Nie, dcéra moja, mýliť sa je ľudské.              ', 150, 4.12, 51),
	(11236, '"Pán výpravca, a dočkám sa vôbec toho vlaku?" ironizuje cestujúci.\r\n"Prečo nie, veď ste ešte mladý!"              ', 124, 4.11, 51),
	(11237, 'Už to ďalej nemusíš skúšať. Tá zápalka už nebude horieť.\r\n"To je čudné, veď pred chvíľkou ešte horela."              ', 134, 4, 51),
	(11238, 'Do obchodu s koženou galantériou vojde zákazník:\r\n- Prosil by som si rukavice na šoférovanie.\r\n- Aké číslo? - pýta sa predavačka.\r\n- BAV 20-83.              ', 168, 3.8, 51),
	(11239, 'Lepší kondóm v dierke ako dierka v kondóme.              ', 61, 4.08, 51),
	(11240, 'Hovorí podnikateľ svojmu zamestnancovi:\r\n- Vy ste, pán Novák, velká opora našej firmy. Neviem, ako by sme bez vás vydržali, ale v budúcom mesiaci to chceme skúsiť.              ', 188, 4, 51),
	(11241, 'Sedia dve muchy na lajne a jedna si grgne a druhá na to: Nevidíš že obedujem!              ', 95, 3.77, 51),
	(11242, 'Čo si dáva bulimička ako dezert?\r\n- Dva prsty...              ', 65, 3.55, 51),
	(11243, 'Jeden skonštatoval:\r\n"Ak pri kosení trávy strácate rovnováhu, rýchlo v nej začnite hľadať jednu nohu."              ', 125, 3.83, 51),
	(11244, 'Povedz tvojej priateľke nech si tak často nemení rúž na pery. Už sa mi totiž začína robiť okolo vtáka dúha.              ', 133, 4.09, 51),
	(11245, 'Naštvaný hosť v reštaurácii hlasno volá na vrchného:\r\n- Pán vrchný, máte zapchaté uši?\r\n- Moment, spýtam sa v kuchyni.              ', 145, 3.55, 51),
	(11246, 'Hrajú dvaja opilci šach na kanálovej mriežke. Po chvíli jeden hovorí:\r\n- Boha mu, kto nám furt berie figúrky?              ', 131, 3.91, 51),
	(11247, '- Prepáčte, pane, tento stôl je obsadený!\r\n- Tak ho odneste a prineste mi druhý!              ', 99, 3.36, 51),
	(11248, 'Prišiel veselý muž do reštaurácie, sadol si za stôl \r\na čašník sa ho pýta:\r\n- Vaše prianie?\r\n- Všetko najlepšie!              ', 139, 3.61, 51),
	(11249, '- Ako ti chutilo to čínske jedlo?\r\n- Bolo skvelé, iba tie paličky mi zostali ležať v žalúdku...              ', 117, 4, 51),
	(11250, '- Oblečte sa, slečna, odveziem vás domov.\r\nHovorí hosť peknej čašníčke.\r\n- Vidím, že v účte ste už aj vy.              ', 133, 4.11, 51),
	(11251, 'Aký je rozdiel medzi pivovým pohárom a debilom? \r\nPivový pohár má jedno ucho a ty dve.              ', 106, 3.63, 51),
	(11252, 'Kedy má narkoman najťažšie časy? \r\nV zime. Nerastie tráva.              ', 78, 3.41, 51),
	(11253, 'K lekárovi príde muž, že už mu neslúži. Doktor mu ho vezme do ruky, chvíľu s ním pracuje a on sa postaví. \r\n- Čo ešte chcete?\r\n- Pusinku...              ', 166, 4, 51),
	(11254, 'Príde ráno unavený manžel domov a hovorí svojej žene:\r\n- To ti ďakujem, kvôli tebe som bol do rána zavretý na polícii.\r\n- Snáď kvôli sebe, nie? Že si sa zase niekde opil?\r\n- Nie, kvôli tebe. Tebe predsa napadlo dať na vkladnú knižku také sprosté heslo: Peniaze alebo život.              ', 309, 3.78, 51),
	(11255, '- Drahý vstávaj už ide autobus!\r\n- A čo ležím na ceste?              ', 75, 3.8, 51),
	(11256, 'Čo je to 90-50-90?\r\nJazda mestom okolo dopravného policajta.              ', 76, 4.26, 51),
	(11257, 'Čo dostaneme, ak skrížime slona s klokanom? \r\nObrovské diery po celej Austrálii.              ', 99, 3.79, 51),
	(11258, 'Príde chlap do Zeleniny a vraví predavačke: \r\n- Strčte si mrkvu do zadku! \r\nPredavačka nechce veriť vlastným ušiam: \r\n- Ako prosím... ?!???!\r\n- Vňaťou von.              ', 180, 4.15, 51),
	(11259, 'Sudca vraví obžalovanému:\r\n- Vy ste Kropáčikovi povedali, že je idiot. Vyslovte nad tým svoju ľútosť.\r\n- Slávny súd! Veľmi ľutu-jem, že Kropáčik je idiot!\n', 172, 3.95, 51),
	(11260, 'Sedia dvaja laboranti na schodoch popíjajúc denaturák a jeden vraví: \r\n"Do šľaka, to sa dneska nejako rýchlo stmieva."              ', 139, 4, 51),
	(11261, 'Bol raz jeden kráľ, ktorý mal troch synov. Hovorí im:\r\n- Synovia moji, vystreľte každý z luku a to, kam strela dopadne, bude pre vás znamením s kým sa máte oženiť.\r\nStalo sa. Najmladší kráľovič trafil prostredného do riti a najstarší si strelil do ruky.              ', 288, 4.12, 51),
	(11262, 'Keď som bol dieťa, celé noci som sa modlil, aby mi Boh zoslal nový bicykel. Potom som pochopil, že takto Boh nepracuje. Tak som bicykel ukradol a požiadal ho o odpustenie.\n', 178, 4.19, 51),
	(11263, 'Rímsky cisár hovorí gladiátorom:\r\n- Kto vyhrá tento zápas vo vodnom póle, dostane slododu.\r\nJeden z gladiátorov sa pýta:\r\n- A ako sa rozoznáme od súpera?\r\nCisár sa uškrnie a hovorí:\r\n- Jednoducho, krokodíly budú mať biele čiapočky.              ', 264, 4.25, 51),
	(11264, 'Idú dvaja po moste a na jeho konci vidia budovu s obrovským nápisom: \r\n"Bieli s gumou 1.000,- Kč, čierni bez gumy zadarmo". \r\nOkamžite tam vbehnú a hneď sa hrnú k dverám na poschodie. Z recepcie sa ozve: \r\n"Páni, iba by som vás chcel upozorniť, že tu nie je bordel, ale klub bungee jumpingu !!!"              ', 323, 4.17, 51),
	(11265, 'Falošný hráč, Tony Rowdman, mal na zápästí ľavej ruky vytetovanú ružu. Mrzelo ho to, lebo podľa tej ruže ho všade identifikovali. Jedného dňa si tú ruku odsekol. A tak teraz, keď na neho šerif Stone vypisuje zatykač, musí do kolónky \'zvláštne znamenie\' napísať: Žiadne...              ', 311, 3.37, 51),
	(11266, 'Rýchly Jack sa miluje s Mary. Zrazu niekto zaklope, Rýchly Jack vyskočí von oknom a Mary ide otvoriť. Pri dverách sa spýta: \r\n- Kto je tam?\r\n- To som ja, Rýchly Jack. Zabudol som si nohavice.              ', 213, 4.05, 51),
	(11267, 'Rozprávajú sa dvaja požiarníci:\r\n- Tak čo, ako stráviš veľkonočné sviatky? Čo si pripravuješ?\r\n- No čo... Manželku nechám tak a na svokru si požičiam vodné delo.              ', 193, 3.9, 51),
	(11268, '- Ach ja nešťastnica, zmeškala som vlak!\r\n- narieka babka na stanici.\r\n- Babka a o koľkej to bolo?\r\n- Len o dve minútky, synak!\r\n- Tak nenariekajte, ako by to boli dve hodiny!              ', 194, 3.42, 51),
	(11269, 'Príde pani do mäsiarstva.\r\n"Dobrý deň, máte zmrznuté držky?"\r\n„Nie! My si tu kúrime."              ', 109, 4.18, 51),
	(11270, 'Výroky, ktoré boli posledné\r\nČo asi robí tento gombík?\r\nLen cez moju mŕtvolu!\r\nKrotím levy už desať rokov, aha.\r\nNeboj sa, ja s tým viem zaobchádzať.              ', 176, 4.17, 51),
	(11271, 'Príde malá žabička ku zverolekárovi a má na hlave ponožku. Doktor zopne ruky a hovorí"\r\n"Žabička, kto ti to urobill?!"\r\nA žabička"\r\n"Drž hubu starý. Toto je prepadnutie!" \n', 186, 4.17, 51),
	(11272, 'Drevorubač príde pri nešťastí \r\no ruku. Lekári mu povedali, že je tu šanca nasadiť mu umelú ruku ovládanú hlasom. Ruka má byť rovnako dobrá a možno aj silnejšia, ako živá. Drevorubač ruku prijme. Nasledujúci deň ide na záchod :\r\n"Rozopnúť!" \r\n"ZZZZZZZZZ" \r\n"Podržať!" "..............." \r\n"Pretrepať!"\r\n"Plesk, plesk, plesk..." \r\n"AAAAAU! Nechceš mi ho náhodou odtrhnúť?" \r\n"Krach..." \r\n"AAAAAAAAAA !!! Do ritiiiiiii !" \r\n"Šup..." \r\n"Ouuuuuu !!! Do hajzlaaaaa !" \r\n"Člup..."              ', 521, 4.18, 51),
	(11273, 'Príde mladý muž do obchodu a pýta sa slečny:\r\n"Máte fínsku vodku?"\r\n"Nemáme."\r\n"A máte Johnie Walker?"\r\n"Nemáme."\r\n"A máte dnes večer čas?"\r\n Ona sa začervená a usmeje:\r\n"Mám."\r\n"Tak si sadnite a napíšte objednávku."              ', 249, 4.16, 51),
	(11274, 'Sedí starček na strome \r\na jeden z okoloidúcich sa ho pýta: "Tak čo, dedko, Redbull, Redbull?" \r\n"Nie synak, pitbul, pitbul!"               ', 145, 4.09, 51),
	(11275, 'Smetiari odvážajú kontajner. Blíži sa stará Petrásková s odpadkovým košom a volá: \r\n"Dúfam, že nejdem neskoro?" \r\n"Ale kdeže, naskočte si."\n', 155, 4.12, 51),
	(11276, 'Staví sa kulturista s erotomanom, kto dlhšie vydrží. Kulturista bude nosiť na druhé poschodie ženské \na erotoman ich bude uspokojovať, kto to vydrží dlhšie vyhráva. Večer začne kulturista nosiť a erotoman každú uspokojuje. Tak to ide celú noc. Ráno kulturista so slovami "ja už nemôžem" odpadne. Z toho plynie poučenie - je lepšie mať styky ako donášať.\n', 383, 4, 51),
	(11277, 'Viete prečo majú čerti kruhy pod očami? Lebo "čert nikdy nespí".              ', 84, 3.48, 51),
	(11278, 'Ako najdeš Esmeraldin dom?\nJednoducho.Na dverách nemá kukatko.              ', 79, 2.54, 51),
	(11279, 'Človeku amputujú ruku a prirobia mu takú čo sa ovláda hlasom. On potom ide na záchod a hovorí: \n"rozopnúť zips, chytiť, podržať, otrepať... nie odtrhnúť, do riti, do hajzlu!"              ', 203, 3.4, 51),
	(11280, 'Opitý muž sadne do lietadla a  náhle mu príde zle. Stewarktka mu podá sáčok a povie mu, že keď bude zvracať, nech to vypustí do sáčku. Stewartka odíde na WC a keď sa vráti je cele litadlo ogrcané. Pýta sa ho "pane ako ste ozvracal celé lietadlo, ako je to možné? A on "keď bol sáčok plný, tak som trošku odpil a ľudia začali so mnou zvracať".                ', 387, 4.24, 51),
	(11281, 'Na jeseň na náhrobku sedia dvaja duchovia. Je sychravá noc, fúka severák a popŕcha. Obaja duchovia sa klepú od zimy. Jeden vraví:\n"Neviem, ako vy, ale ja som sa naposledy poriadne ohrial v krematóriu."              ', 224, 4.22, 51),
	(11282, '”Pán doktor, čo je to s mojím šteniatkom? Keď mu dám povel, vždy odpadne.”\r\nDoktor na to:\r\n”Tak to vyskúšajte.”\r\nChlapík sa nadýchne a z plného hrdla zreve:\r\n”ĽAHNI!”              ', 205, 4.17, 51),
	(11283, '”Mišo, kde si si nechal hodinky?”\r\n”Ále, tie idú vždy dopredu. Asi sú už doma!”              ', 107, 3.88, 51),
	(11284, 'Ráno zazvoní telefón. Pán ho zodvihne a pýta sa:\r\n”Kto je tam?”\r\n”Tu je budenie telefónom. Vy ste sa dali zobudiť ráno o siedmej?”\r\n”Áno dal.”\r\n”Tak šup šup hore, vy spachtoško, už je desať.”               ', 236, 4.17, 51),
	(11285, 'Na Nebeskú bránu klope muž a strašne sa rehoce. Otvorí mu\r\nSv.Peter:\r\n-Prečo sa tak strašne smejete?\r\n-Ále, dole ma operujú, a ja už som tu!              ', 164, 3.94, 51),
	(11286, 'V Zoo stojí pri klietke s vlkom jeden človek opitý na mol a hádže do neho všetko, čo má po ruke. Strážnik Zoo príde ku nemu a pýta sa ho:\r\n"Pane, čo to robíte? Čo vám ten vlk urobil?"\r\n"Mne? Mne nič, ale táto sviňa zožrala karkulku."               ', 268, 4, 51),
	(11287, 'Netrpezlivý hosť hovorí čašníkovi:\r\n”Prineste mi roštenku, prosím! Ale občas mi pošlite z kuchyne pohľadnicu, aby som vedel, že ešte žijete!”              ', 173, 3.33, 51),
	(11288, '- Prepáčte mi slečna, ale zdá sa mi, že som Vašu tvár už niekde videl.\r\n- Vylúčené, pane. Nosím ju stále na rovnakom mieste.              ', 151, 3.83, 51),
	(11289, 'Hovorí Fero Mišovi:\r\n”Vieš, čo som zistil? Že je veľmi nezdravé piť z cudzieho pohára.”\r\n”A prečo? Dostal si nejaké vyrážky?”\r\n”Nie! Dostal som po papuli!”              ', 194, 3.57, 51),
	(11290, 'V príjemnej reštaurácii:\r\n”Pán vrchný! Tá polievka je totálne priesvitná!”\r\n”To preto, aby ste sa mohli kochať pohľadom na ornament, ktorý máte na spodku taniera.”              ', 197, 4.18, 51),
	(11291, 'Tlačí chlapík káru popri vlaku a kričí:\r\n”Langoše, čerstvé langoše!”\r\nZrazu sa niekto vykloní z vlaku a pozvracia mu ich.\r\nChlapík začne kričať:\r\n”Pizza, pizza!”              ', 198, 4.03, 51),
	(11292, 'Malý čertík sa hnevá na dvojmetrového Mikuláša:\r\n”Ja som ti hovoril, aby sme sa vymenili - deti by nemali utekať pred Mikulášom!”              ', 157, 4.1, 51),
	(11293, 'Stojí na sídlisku snehuliak a na hlave má slúchadlá. Chváli sa ostatným snehuliakom:\r\n”Tak, tentoraz ma na Silvestra už nijaký ohňostroj nezaskočí!”              ', 178, 3.91, 51),
	(11294, 'Sedia dvaja blázni v izbe\r\na jeden hovorí:\r\n”Som Mojžiš a Pán Boh mi dal desať božích prikázaní.”\r\nDruhý na to:\r\n”Čo som ti to dal?”              ', 166, 4, 51),
	(11295, 'V autobuse:\r\n”Pán šofér, zastavte, Tamagočimu je zle!”              ', 76, 4.1, 51),
	(11296, 'Kolegovia v práci:\r\n”Som hladný. Tu máš 50 Sk, skoč, prosím ťa, do obchodu a kúp mi 20 dkg šunky. Ak nebudú mať šunku, tak mi kúp niečo iné.”\r\nKolega sa o polhodinku vráti a vraví:\r\n”Šunku nemali, tak som ti kúpil 10 päťkorunových známok.”              ', 284, 3.38, 51),
	(11297, 'Vo vínnej pivnici sa hosť pýta:\r\n”Pán hlavný, čo je to tu za divný zápach?”\r\n”To je čerstvý vzduch, vetráme.”              ', 142, 4.17, 51),
	(11298, 'Fero s Ančou sú na diskotéke. Fero vraví Anči:\r\n”Anča, poď tancovať.”\r\n”A ja nejdem.”\r\n”Anča, pod tancovať, dám ti ružu.”\r\n”A ja nejdem.”\r\n”Anča, ty krava sprostá, poď tancovať.”\r\n”No, keď tak pekne prosíš.”              ', 264, 4.11, 51),
	(11299, '- Mali by ste sa občas aj umývať. - hovorí lekár pacientovi.\r\n- Ale veď ja sa umývam každý deň!\r\n- Tak v tom prípade musíte občas aj vymeniť vodu.              ', 174, 3.75, 51),
	(11300, 'Chlapík tlačí popri vlaku vozík a kričí: "Langoše! Čerstvé langoše!\r\nKúpte si langoše!\r\nVtom sa vykloní z okna chlapík a všetko mu ogrcia.\r\nPredavač:......" Pizza! Čerstvá pizza! Kúpte si pizzu!"\n', 215, 4.06, 51),
	(11301, 'Na recepcii sa sťažuje rozčúlený hosť:\r\n- Na chodbe sa na mňa tlačil hosť z izby č. 215. Asi nejaký teploš alebo čo...\r\n- A prečo ste pred ním neušli?\r\n- To nešlo, v tejto úzkej sukni...              ', 218, 3.94, 51),
	(11302, 'Ide hovno a zadok do pivnice a hovno hovorí: \r\nJe tu tma ako v zadku !\r\nA zadok na to:\r\nJa tiež hovno vidím !                ', 128, 3.94, 51),
	(11303, '"Povedz mi číslo a ja ti poviem rým."\r\n"Tak trebárs - tri."\r\n"Riť si vytri!"\r\n"A teraz ty."\r\n"Päť."\r\n"Riť si vytri a dve ti zostanú!!!"\n', 145, 3.19, 51),
	(11304, 'Príde chlap so zdochnutým psom za farárom a vraví:\r\n- Pán farár, umrel mi pes, prosím vás, pochovajte ho!\r\n- Ale veď viete, že sa to nedá!\r\n- Ale ja som s tým psíkom žil desať rokov a mal som ho veľmi rád!\r\n- Ale veď pes nemá dušu. Nemožno ho pochovať ako človeka!\r\n- Pán farár a za dvadsaťtisíc korún by sa to nedalo?\r\n- Vážený, mali ste hneď povedať, že ten pes bol katolík!\n', 412, 3.91, 51),
	(11305, 'Manželia idú večer na cintorín a otvárajú hrob. Staršia pani sa pýta, čo to robia:\r\n”Ale, boli sme večer v kine, tak sme dali deti zatial k našim.”              ', 176, 3.11, 51),
	(11306, 'Príde raz koktavý do metra a pýta sa jedného cestujúceho:\r\n- Ko - ko - ko koľko je ho - ho - ho hodín p - p - pros - s - s - s -  ím v - v - vás?\r\n- Cestujúci mlčí a mlčí, a tak pán sa opýta iného a odíde.\r\nNačo sa ostatní pýtajú toho tichého:\r\n- Prečo ste mu, chlape, neodpovedali?!!\r\n- B - b - bál s - s - som  sa, že mi rrr - ro - zbi -  bije hu - hu hubu.              ', 399, 3.85, 51),
	(11307, '- V reštaurácii Orion si vždy dáme poriadne do nosa! - hovorí Jožo. \r\n- To tam majú takého dobrého kuchára? \r\n- Nie, ale lietajúce dvere!              ', 162, 3.5, 51),
	(11308, '- Ako to robíš , že sa vždy trafíš do stredu terča ?\r\n- No, najprv strelím, potom kreslím terč.\n', 106, 4.18, 51),
	(11309, '- Nevideli ste moje syrové ponožky?\r\n- Prečo syrové?\r\n- Sú žlté a majú diery.              ', 99, 3.86, 51),
	(11310, '- Ako mohol utiecť odsúdený z cely č. 213? - pýta sa riaditeľ väznice.\r\n- Mal kľúč, pán riaditeľ, - odpovie dozorca.\r\n- Kde ho ukradol?\r\n- Neukradol, ale poctivo vyhral v kartách.              ', 206, 4.07, 51),
	(11311, '- Pán doktor, ako dopadla moja operácia?\r\n- Ja neviem, ja nie som doktor, ja som Svätý Peter.              ', 111, 3.92, 51),
	(11312, '- Hovoril si niečo? \r\n- Nie! \r\n- Tak som dobre počul.              ', 69, 3.63, 51),
	(11313, '- Sused, fajčia vaše kravy?\r\n- Čo vám šibe?\r\n- Tak potom Vám horí maštaľ!               ', 97, 3.81, 51),
	(11314, 'V pivnici sa pýta hosť šéfa: "Čo je to tu za divný zápach?" \r\n"Čerstvý vzduch, pane, vetráme."              ', 118, 3.75, 51),
	(11315, 'Predám biely pracovný odev, bez jednej ruky.\r\nZn. Cirkulárka\n', 64, 3.4, 51),
	(11316, 'Jedného dňa sa v chlapíkovi ozve tajomný vnútorný hlas: "Vyber si z účtu všetky peniaze...". Chlapík je prekvapený, ale splní to. Tajomný vnútorný hlas sa však ozve znovu: "Bež do kasína...". Chlapík je už sám zvedavý, tak uteká do kasína. "Vsaď všetko na trinástku...", opäť sa mu ozve tajomný vnútorný hlas. Chlapík samozrejme poslúchne, všetko vsadí na trinástku, napäto čaká a padne dvanástka. Tajomný vnútorný hlas sa ozve takmer okamžite: "Á, doriti...".              ', 520, 3.67, 51),
	(11317, 'V bare hrajú dvaja poker.\r\n- "Ja mám tri esá a Vy?", pýta sa jeden druhého.\r\n- "Iba revolver a v ňom dve guľky..."\r\n- "Tak to ste vyhral, pane! Že ale máte dnes čertovské šťastie!"              ', 207, 3.64, 51),
	(11318, 'Chlapík vojde do baru a objedná si pivo. Keď mu ho barman prinesie, spoza baru vyskočí malá opica, vymočí sa mu do pohára. Chlapík najskôr neverí vlastným očiam, ale potom sa spýta barmana, komu patrí ta opica. Barman Phil iba ukáže na pianistu sediaceho na pódiu za pianom. Chlapík k nemu nahnevane príde a spýta sa:\r\n- A to viete, že vaša opica sa mi vyšťala do piva?\r\n- Nóó, keď mi zahmkáte melódiu, tak to voľajako zahrám...              ', 475, 3.54, 51),
	(11319, 'Príde kovboj Joe do salónu a vidí, ako pri jednom stole sedí osamotená krásna kočka. Rozmýšľa, ako by sa s ňou zoznámil, potom vytiahne kolty a všetkých ostatných postrieľa. Pomalým krokom príde až k stolu, prisadne si a hovorí: "A čo tak sama, slečna..."              ', 291, 4.12, 51),
	(11320, '"V tejto reštaurácii majú výborné slimáky!" \r\n"Naozaj?" \r\n"Práve nás jeden obsluhuje."              ', 108, 3.83, 51),
	(11321, 'Lord si vyjde na hon a sluha mu privedie svorku chrtov a praje mu pekný lov. Lord odíde za kopec. Hneď nato počuť strieľanie a rev. Po chvíli sa lord vráti a sluha sa ho pýta:  \r\n„Aký bol lov?"\r\n„Dobrý, veľmi vydarený, až na to, že mi došli chrty."              ', 282, 4.2, 51),
	(11322, 'Dvaja horolezci na zvislej stene. Horný hovorí dolnému: \r\n„Strašne sa mi chce čúrať, čo mám robiť?" \r\n„Musíš vydržať, skús autosugesciu. Opakuj si, že sa ti nechce." \r\n„Nechce sa mi čúrať, nechce sa mi čúrať, nechce sa mi čúrať." \r\nPo chvíli sa ten spodný pridá: \r\n„Netečie na mňa, netečie na mňa..."              ', 354, 4.17, 51),
	(11323, 'Traja odsúdení na 20 rokov väzenia si môžu vziať do cely jednu vec. Prvý si berie so sebou  kopu kníh, druhý si zoberie manželku a tretí dvesto kartónov cigariet. Po 20 rokoch otvoria prvú celu, prvý muž vyjde a hovorí: \r\n"Študoval som tak, že môžem byť aj advokát." \r\nDruhý muž vyjde so ženou a 5 deťmi a povie: \r\n"Bolo to krásne. Ja a moja manželka sme si boli takí blízki."\r\nOtvoria tretiu celu a muž v nej si potľapkáva po vreckách a hovorí: \r\n„Nemá tu niekto zápalky?" \n', 514, 3.38, 51),
	(11324, '„Pán vrchný, mám hlad ako vlk." \r\n„Ľutujem, ale Červené čiapočky nemáme."              ', 100, 3.71, 51),
	(11325, '"Pán vrchný, mohli by ste mi odporučiť niečo výživného?"  \r\n"Dajte si smažený rezeň, pane, ten Vám bude ležať týždeň v žalúdku."              ', 161, 3.67, 51),
	(11326, 'Viete, ako volá manželka na obed svojho manžela  vegetariána?\r\n- Poď už jesť, lebo ti zvädne obed.              ', 120, 4, 51),
	(11327, 'Hosť v krčme volá na čašníka... \r\n„Haló, čašník, volám Vás, haló, volám Vás, čašník..." \r\nČašník: \r\n„No, čo to bude pane?" Hosť: \r\n„Jedno pivo a vodku ... a ... na účet volaného prosím!"              ', 233, 3.75, 51),
	(11328, 'Ponáhľa sa jeden po pohyblivých schodoch a skočí pri tom druhému na nohu. Po pár krokoch si to rozmyslí a vráti sa: \r\n- Prepáčte pane, nechcel som vam stúpiť na nohu. \r\n- Nemusíte sa mi ospravedlňovať, už som vám napľul na chrbát.              ', 264, 4.19, 51),
	(11329, 'Medzi dvoma kovbojmi:\r\n- Ty si ale poriadne spyšnel!\r\n- Prečo?\r\n- Keď som včera po tebe strieľal, ani si sa neotočil.              ', 137, 3.6, 51),
	(11330, 'Sedí si na izbe neurotik, keď sa otvoria dvere, pomaly sa vkradne flegmatik, podíde k umývadlu, naberie na kávovú lyžičku vodu a odíde... O chvíľu zase príde, naberie za lyžičku vody a odíde. A zase príde, naberie za lyžičku vody a odíde. Neurotikovi už stúpa žlč, trhá papier, žmolí prsty, škrípe zubami a keď ešte dvakrát príde flegmatik po lyžičku vody už sa neovládne a s penou na hube na na neho zreve: \r\n- Kurňa, načo je ti tá voda!??!!!!\r\n- Horíme...              ', 511, 3.89, 51),
	(11331, 'Idú sa dve kostry povoziť na motorke a jedna vraví: \r\n"Počkaj chvíľu." \r\nZa chvíľu sa vráti aj s náhrobným kameňom. \r\n"Čo to má znamenať?" pýta sa druhá. \r\n"Mesto je plné dopravákov, predsa nebudeme jazdiť bez papierov."              ', 254, 3.88, 51),
	(11332, 'Dvaja horolezci lezú do vrchu. Jeden z nich sa po hodine namáhavého výstupu ozve:\r\n- Človeče, ja si už ani nohy necítim..\r\nDruhý mu odpovie:\r\n- Tak ovoňaj moje ...              ', 187, 4, 51),
	(11333, 'Prišiel chlapík do krčmy s írskym vlkodavom - taký ten pes veľkosti staršieho teľaťa. Uviazal psa vonku a dal si pivo. Za chvíľku prišiel druhý chlapík, tak sa rozhliadol, podišiel k nemu: \r\n- Počuj, to je váš pes, ten vonku?\r\n- Hej, prečo?\r\n- No, mám pocit, že ho môj pes zabil.\r\n- Počujte, čo máte za psa, že by dokázal zabiť vlkodava?"\r\n- No, ratlíka.\r\n- To mi teda vysvetlite, ako môže ratlík zabiť vlkodava.\r\n- No, myslím, že tomu vašemu zaskočil v krku.              ', 510, 3.43, 51),
	(11334, 'Obrovská doga vojde do baru a objedná si whisky. \r\n- Čo som dlžná? \r\n- Sto korún, odpovedá barman a dodá: \r\n- Psa som ešte nikdy neobsluhoval...\r\n- Pri tých vašich cenách som tu naposledy, odpovie doga.              ', 228, 3.33, 51),
	(11335, 'Na pumpu príde škriatok a hovorí:\r\n- Prosím si dve kvapky benzínu a jednu kvapku oleja.\r\nNa to mu predavač hovorí:\r\n- A prdnúť do gúm nechcete?              ', 167, 3.9, 51),
	(11336, 'Ministerská kontrola príde na inšpekciu do väzenia. Brána dokorán otvorená, žiadne stráže, mreže odomknuté, cely bez zámkov a všetci ticho sedia na svojich miestach. Pýtajú sa riaditeľa väzenia, ako sa mu to podarilo.\r\n- Jednoducho, dal som na celách zaviesť internet.              ', 302, 4, 51),
	(11337, 'Zobudí sa chlapík po brutálnej ožranpárty. V hlave včelín a nejdú mu hodinky. Zdvihne telefón a zavolá na presný čas. Počítačový hlas mu hlási:\r\n- Je 11 hodín, 35 minút, 17 sekúnd...\r\n- A mesiac, kua, mesiac je aký???              ', 252, 3.96, 51),
	(11338, 'Otecko s dcérkou stoja pred výkladom obuvi a dcérka vraví oteckovi:\r\n"Oci, kúp mi tie topánočky."\r\n"Čuš. Najskôr znosíš korčule!"\n', 143, 3.86, 51),
	(11339, '"Prosím vás, koľko je hodín?"\r\n"Desať desať."\r\n"Ďakujem ďakujem."              ', 87, 3.75, 51),
	(11340, 'Čo ťa nepáli nejedz.              ', 37, 3.4, 51),
	(11341, 'Študent sa sťažoval na zlé ubytovanie:\r\n- A čo je na tom vašom bývaní také strašné?\r\n- Napríklad myši.\r\n- To nie je možné!\r\n- Tak sa poďte pozrieť.\r\nVošli do izby, študent zobral kúsok chleba a začal na zem sypať odrobinky. Po chvíli sa objavila myška, za ňou druhá, tretia... potom sa objavila rybka, a po nej zase myši.\r\n- No, fakt sa nejako premnožili. Ale čo tá rybička?\r\n- Tak už mi veríte, že tu máme myši? Takže sa môžeme začať baviť o vlhkosti.              ', 508, 4.23, 51),
	(11342, 'Koktavý sa chváli: \r\n„Pppozrrite, aaké mmáám kkkrásne cc-ce-cellullloidové pppravvíítko. Mmmôžem ho ooohhnúť do ľľľavva, aj ddo ppp-prdele, zzzlomilllo sa mmi!"              ', 192, 3.9, 51),
	(11343, 'Ide takto autobus a naraz sa zozadu ozve:\r\n- Pán vodič, zastavte, Tamagochimu je zle!              ', 101, 3.73, 51),
	(11344, 'Koncert Slovenskej filharmónie. Skladba vrcholí, búrlivú pasáž strieda mierna, až tichá pasáž. Tu sa\r\nz predného radu zodvihne človek a do ticha zvolá: \r\n„Je tu, prosím vás, niekde lekár?“ \r\nVzadu sa zdvihne postava a spredu sa ozve: \r\n„Pán doktor, ale hrajú, čo?!“              ', 306, 3.13, 51),
	(11345, '„Nie sú v tunajšom lese hady?“\r\n„Kdeže! Minule tu boli lesní znalci a všetko to tu odhadovali.“              ', 122, 4, 51),
	(11346, 'Sedia  dve  babky  na lavičke a tretia hovorí: z nás by bola pekná štvorica.\n', 82, 3.75, 51),
	(11347, 'Hľadáme telepatov.\r\nZnačka:  Viete kde.              ', 56, 4.07, 51),
	(11348, 'Policajt zastaví auto a hovorí vodičovi: \r\n”Gratulujem, vyhrali ste odmenu 500 USD, lebo ste prvý vodič, ktorý mal dnes večer zapnutý pás.”\r\n”To vám pekne ďakujem, konečne si budem môcť spraviť vodičák.” \r\nVedľa neho sedí jeho žena: \r\n”Ale no. Viete, on vždy keď má vypité, tára.” \r\nZozadu sa ozve hlas: \r\n”Ja som vám to hovoril, že nás cez hranice bez pasu nepustia.” \r\nA z kufra sa ozve hlas: \r\n”My uz byť v Mexiko?”              ', 481, 4.13, 51),
	(11349, 'Rozčuľuje sa starý pán v autobuse:\r\n-Tá dnešná mládež! To je strašné, ako sa obliekajú, napríklad tam ten mladík.\r\n-Ten mladík, to je moja dcéra.\r\n-Ach, prepáčte! Nevedel som, že ste jej matka.\r\n-Ja som jej otec...              ', 247, 3.45, 51),
	(11350, 'V salóne sa hádajú kovboji, kto je lepší strelec. Jede mladý vraví sebavedome: \r\n”Vidíte tamtú žiarovku?” Vytiahol svoju štyridsaťpäťku a prásk! Žiarovka sa rozprskla. Starý kovboj mu poklepe na rameno. \r\n”Teraz sa pozri, mladý!” Vytiahne búchačku, zamieri na ďalšiu žiarovku a prásk! - žiarovka zhasla, zamieri znova - prásk! - žiarovka sa znovu rozsvieti. \r\n”To ste celí vy, mladí. Prečo hneď všetko ničiť? Stačí povoliť...a zase dotiahnuť!”              ', 507, 4.09, 51),
	(11351, 'Dvaja železničiari:\r\n- Počul si? Novák dostal hodinovú výpoveď. A to len preto, že neoznámene vošiel do šéfovej kancelárie.\r\n- Iba preto?\r\n- No, je pravda, že on tam vošiel s lokomotívou...\n', 206, 4.15, 51),
	(11352, 'Príde pán do reštaurácie a objedná si polievku, v ktorej nájde dlhý, mastný vlas. Okamžite si zavolá čašníka a vraví: \r\n„Pán vrchný, v polievke bol tento vlas, ako je to možné?!”\r\nČašník sa začuduje: \r\n„No, to je naozaj divné. Celému personálu predsa vlasy vypadali pri tej úplavici...”              ', 334, 4.2, 51),
	(11353, 'Anjel pristúpi k dvom sochám v parku a hovorí:\r\n"Za to, že tu tak trpezlivo stojíte vám dám polhodinu života. Potom sa opäť zmeníte na sochy."\r\nSochy sa rozbehnú do kríčkov, odkiaľ je počuť zaujímavé vzdychy. O pätnásť minút vybehnú z kríkov a anjel im hovorí:\r\n"Ešte máte pätnásť minút."\r\nSochy sa opäť rozbehnú do kríkov a jedna hovorí:\r\n"Teraz toho holuba podrž ty a oseriem ho ja!"                   ', 442, 4, 51),
	(11354, 'Napísané v jednej krčme:\r\n"Neľakajte sa našej kávy ... i vy raz budete slabí a studení!"\n', 97, 3.8, 51),
	(11355, 'Fero utrpí na stavbe nehodu a príde o uši. Keď sa má vrátiť, majster upozorňuje všetkých a zvlášť Joža, aby boli k Ferovi milí a aby mu to nepripomínali. \r\nFero prvý deň v práci robí s Jožom a ten chce kolegovi zdvihnúť náladu: \r\n"Pozerám, že sa ti zlepšil zrak?"\r\n"Prečo myslíš?"\r\n"No, lebo už nenosíš okuliare."\n', 347, 3.45, 51),
	(11356, '"Vedel by ste povedať, ako ten útočník vyzeral?" pýtal sa policajt, keď pomáhal zbitému mužovi na nohy.\r\n"Ale áno, práve som mu to hovoril, keď ma začal mlátiť."\n', 177, 3.92, 51),
	(11357, 'Dvaja mladíci v galérii moderného umenia. \r\nOkolo nich samé ohnuté trubky, rozbité sklo. Jeden hovorí:\r\n"Padáme, než nás obvinia, že sme to tu my rozbili."\n', 167, 4.09, 51),
	(11358, 'Viete, že budú stavať supermarket pre sklerotikov?\r\nDostanú tam všetko, na čo si spomenú.\n', 97, 3.14, 51),
	(11359, 'Nastúpi chlap do väzenia. Mazáci mu vravia, aby zavolal na dozorcu a vypýtal si dvanástku Plzeň. Dozorca príde, chlap sa nakloní k okienku, pýta si dvanástku. \r\nDostane ranu päsťou. Keď sa za pár minút preberie, zabúcha znova. Dozorca príde, nakukne a dostane ranu spať so slovami:\r\n"Tu vraciam fľašku."\n', 324, 4.2, 51),
	(11360, 'Dvaja páni idú oproti sebe v parku po ceste a obaja za sebou ťahajú pravú nohu.\r\nJeden sa na druhého s porozumením pozrie, ukáže si na nohu a hovorí:\r\n"Kuvajt, 1993."\r\nA druhý ukáže palcom za seba a hovorí:\r\n"Psie hovno, desať metrov odtiaľto."\n', 261, 4.14, 51),
	(11361, '"Tak som sa konečne dostal do televízie."\r\n"A ako si sa tam dostal?"\r\n"Odšrouboval som zadnú stenu."\n', 105, 3.77, 51),
	(11362, 'Raz som doma zametal. Zrazu vám pozerám a čo nevidím:\r\nSmeti mi utekajú z lopatky. Pozriem sa bližšie a vidím, že sú to mravce.\n', 138, 3.75, 51),
	(11363, 'Stretnú sa dvaja kamaráti:\r\n"Ty sa tváriš, ako keby ti uleteli včely. To ti zas stará urobila na obed hrachovú kašu?"\r\n"Nie, mal som guláš, ale uleteli mi včely."\n', 174, 3.5, 51),
	(11364, 'Sherlock Holmes a Dr. Watson si vyšli do prírody. Večer si ľahli do stanu.\r\nHolmes sa v noci zobudil, šťuchol do Watsona a hovorí:\r\n"Vidíte tie jasné hviezdy? \r\nČo z toho môžete vyvodiť?"\r\n"Toto nám jasne hovorí, že zajtra bude pekne.\r\n"Nie, Watson, je to omnoho jednoduchšie. Znamená to len, že nám niekto ukradol stan."\n', 342, 4, 51),
	(11365, 'Je veľmi tesná hranica medzi rybárením a postávaním na brehu vyzerajúc ako idiot.\n', 89, 4, 51),
	(11366, 'Karol robil pilotné skúšky a kamoši sa ho pýtajú:\r\n"Tak aké to bolo, ťažké?"\r\n"Nie, len ma naštval jeden grafológ."\r\n"Čo hovoril?"\r\n"Ale, vraj som podľa rukopisu násilník, grobian a bitkár."\r\n"A čo si mu povedal?"\r\n"Rozbil som mu hubu!"\n', 255, 4, 51),
	(11367, 'Ide opitý v električke a zrazu kričí: \r\n"Vy naľavo ste teplí a vy napravo kradnete."\r\nVtom sa jeden postaví a presadne si vľavo:\r\n"Prepáč, bol som na zlej strane."\n', 174, 3.55, 51),
	(11368, 'Bavia sa traja rybári:\r\n"Ja som ulovil päťkilového kapra."\r\n"Ja desaťkilovú šťuku."\r\n"Ja dvadsaťkilového sumca!"\r\nNačo prvý dodá:\r\n"Že ja vôl vždycky začínam prvý."\n', 184, 4, 51),
	(11369, 'Majiteľ reštaurácie príde prvý deň na kontrolu a pýta sa čašníka:\r\n"Bol tu niekto?"\r\n"Áno, ja."\r\n"Sakra, pýtam sa, či niekto prišiel!"\r\n"Áno, vy."\n', 162, 3.91, 51),
	(11370, 'Ktosi v telefóne:\r\n"Vy ste si objednal budenie telefónom na 6:30?"\r\nRozospatý hlas:\r\n"Eeeeech...áno..."\r\n"Tak šup z postele, už je pol deviatej!"\n', 152, 3.86, 51),
	(11371, '"Tamten človek urobil veľa pre divadlo."\r\n"Napísal niečo, alebo to je herec?"\r\n"Nie, vymyslel nešuštiace obaly na cukríky!"\n', 131, 3.88, 51),
	(11372, 'Príde pani nakupovať v zime do zeleniny:\r\n"To sú ale pekné broskyne."\r\n"Ale ani sa nepýtajte, koľko stoja."\r\n"Ale sú fakt pekné, koľko že stoja?"\r\n"90 Sk/kilo."\r\n"Tak za tie prachy si ich môžete tak akurát strčiť do riti!"\r\n"Rád by som, ale už tam mám jahody za 120."\n', 286, 3.5, 51),
	(11373, '"Veríš ty všelijakým veštkyniam a jasnovidkám?"\r\n"No veril som, než som si raz išiel nechať poradiť, zaklopal som na dvere a zvnútra sa ozvalo:"\r\n"Kto je?"\n', 167, 3.93, 51),
	(11374, 'Šéf jednej banky prijal nového pracovníka pre prácu za prepážkou. Keďže má pochybnosti, rozhodne sa ho vyskúšať. \r\nDá si na hlavu punčochu, vezme si pištoľ a ide ho prepadnúť.\r\nNamieri naňho – a pokladník mu vydá celú hotovosť. Od tej\r\ndoby nikto riaditeľa banky nevidel.\n', 299, 4.01, 51),
	(11375, 'Príde pán do realitnej kancelárie:\r\n"Jjja bby som si chcel kukupiť dom, čo máte?"\r\n"Tento tu. Za 6 miliónov."\r\n"Vvezmem si tento."\r\n"Ale ten stojí 20 miliónov! \r\nMáte naň?"\r\n"Jja mmám 60 miliónov!"\r\n"A kde ste ich vzal?"\r\n"Vyvyhral som ich!"\r\n"Ja keby som vyhral 60 miliónov, tak ma porazí."\r\n"Mňňňa tooo lenl líízlo."\n', 339, 3.73, 51),
	(11376, 'Veža na letisku dostane naliehavú správu:\r\n"Tu OK-3, voláme kontrolu. Nemáme benzín!"\r\nSlužbu konajúci muž rýchlo uchopí mikrofón:\r\n"Tu  je kontrolná veža. Nestrácajte hlavu! Popíšte významné body terénu pod sebou!"\r\n"Tu OK-3, volám kontrolnú vežu. Som ešte na letisku a nemôžem sa dočkať tankovacieho vozidla."\n', 340, 4.11, 51),
	(11377, 'Cestujúcim v lietadle sa podáva obed, keď sa lietadlo zrazu otočí okolo pozdĺžnej osy. Nastane strašný zmätok. Za chvíľu príde letuška a oznamuje:\r\n"Vážení cestujúci, ukľudnite sa prosím. Náš pilot má nádchu a práve si kvapká do nosa."\n', 262, 4.2, 51),
	(11378, 'K letisku sa približuje lietadlo, z ktorého trčí 50 párov nôh. Z intercomu sa ozýva kapitán:\r\n"Keď zakričím \'TERAZ!\', utekajte ako o život!"\n', 153, 3.58, 51),
	(11379, 'Zídu sa na strome traja kamaráti - upíry. Všetci majú krvavé\r\nústa a každý sa chváli:\r\nPrvý hovorí:\r\n"Vidíte to stádo ovcí? To som celé vysal JA!"\r\nDruhý hovorí:\r\n"Vidíte to stádo kráv? To je moja práca!"\r\nTretí, s najkrvavejšou tvárou:\r\n"Vidíte tamtú vežu? Tak tú ja som nevidel!"\n', 311, 3.83, 51),
	(11380, '"Vypi, prosím ťa, tento liek," nalieha manželka na manžela.\r\n"Ale veď to nám dal zverolekár pre psa?!"\r\n"No veď práve! Keď ťa Azor uvidí, možno to vypije aj on."\n', 175, 3.82, 51),
	(11381, 'Boháč nemá čo robiť, tak ide na ryby. Čo sa nestane, chytí zlatú rybku. Rybka pozerá, nič nehovorí. Boháč premýšľa a potom vraví: \r\n"Tak hovor, čo by si chcela?"\n', 180, 3.91, 51),
	(11382, 'Príde žena do obchodu a pýta sa: \r\n- Môžem si vyskúšať tie šaty vo výklade?\r\n- Ale kľudne, keby ste chceli máme aj kabínku!              ', 150, 3.2, 51),
	(11383, 'V obchode: \r\n- Máte mak? \r\n- Máme.\r\n- Tak sa ním posyp, ty buchta!              ', 83, 3.7, 51),
	(11384, 'Ide kliešt po ulici a hovorí si:\r\nTo ma zase dnes vytočili!               ', 77, 3.33, 51),
	(11385, 'Do baru vojde kostra:\r\n- Pivo a handru!              ', 53, 3.22, 51),
	(11386, 'Povzdych starého kovboja:\r\n- Odkedy mi zdochol kôň, cítim sa v sedle akýsi osamelý...              ', 105, 3.93, 51),
	(11387, 'Šofér zastaví na hranici, colník sa pýta:\r\n- Cigarety, víno, liehoviny?\r\n- Ďakujem, nebudem, mám toho plný kufor!              ', 136, 3.57, 51),
	(11388, 'Dvaja bežci sa míňajú v parku. Prvý zdvorilo: \r\n- Som Novotný, maratón. \r\n- Teší ma, Králik, hnačka.               ', 126, 3.9, 51),
	(11389, 'Správa: Polícia zatkla podozrivého z predaja tabletiek na udržanie večnej mladosti. Ide o recidivistu trestaného za tento čin v rokoch 1836, 1912 a 1988.               ', 175, 4.21, 51),
	(11390, '"Toto je účet za obed," pýta sa hosť čašníka: "alebo mi chcete predať reštauráciu?"              ', 107, 3.69, 51),
	(11391, 'Na moste stáli dvaja, On a Off!              ', 46, 3.23, 51),
	(11392, '"Dobrý deň, máte farebné televízory?"\r\n"Jasné!" \r\n"Tak si prosím žltý."              ', 94, 3.9, 51),
	(11393, '"Pán vrchný! V polievke mi pláva mucha!"\r\n"A čo by ste chceli za 8.50, aby hrala vodné pólo?"              ', 113, 3.25, 51),
	(11394, '"Pán vrchný! V polievke mi pláva mucha!"\r\n"Nevadí, pozrite, z opačnej strany už k nej krauluje pavúk!"              ', 123, 3.88, 51),
	(11395, 'Čo je teória relativity: \r\nPäť vlasov na hlave, to je primálo, ale päť vlasov v polievke, no to už je priveľa!                  ', 137, 4.22, 51),
	(11396, 'Tri priateľky prostitútky sa medzi sebou chvália:\r\n“Ja som za jednu noc urobila z chlapa impotenta!”\r\n“A ja som za jednu noc urobila z impotenta chlapa!”\r\n“A ja dokážem za minútu jazykom poskladať rubikovú kocku!”\n', 234, 3.5, 51),
	(11397, 'Na potápajúcom sa Titanicu kričí muž:\r\n- Ľudia, zem!\r\n- Kde?\r\n- Tri kilometre!\r\n- A ktorym smerom?\r\n- Rovno pod nami...!              ', 140, 4, 51),
	(11398, 'Sedia dvaja kamaráti v krčme. Jeden sa pýta druhého:\r\n- Počúvaj, kedy si mal búračku?\r\n- Akú búračku?\r\n- Len mi nehovor, že si sa s takým ksichtom narodil!              ', 182, 3.43, 51),
	(11399, 'V knižnici sa pýta pani muža, ktorý prehliada regály:\r\n- Môžem vám pomôcť? Čo hľadáte?\r\n- Hľadám knihu Muž  vládca žien.\r\n- Tak to musíte ísť do vedľajšieho oddelenia, tam sú rozprávkové knihy.              ', 233, 3.7, 51),
	(11400, 'Príde žena k lekárovi s tým, že má malé prsia. On jej poradí, aby sa každé ráno o štvrtej chytila za prsia a spievala "Rozvíjej se poupátko...". Lenže jeden deň cestovala vlakom a v kupé spal aj cudzí chlap. Blížili sa štyri hodiny a žena rozmýšľaľa, čo urobí. Nakoniec však dodržala radu lekára a začala si spievať:\r\n"Rozvíjej se poupátko..."\r\nVtom sa chlap zobudí a vykríkne:\r\n"Čože, to už sú štyri hodiny??? Vysoký jalovec,..."              ', 487, 3.77, 51),
	(11401, 'Hosť volá na čašníka:\r\n- Pán hlavný, prosím vás, nedalo by sa to kurča trochu lepšie dopiecť?\r\n- Zdá sa vám málo upečené?\r\n- Čo ja viem, len mi z taniera vyzobáva zemiaky.              ', 204, 3.57, 51),
	(11402, 'Na túre hovorí sprievodca:\r\n"Keby milostivé dámy na chvíľu zmĺkli, počuli by sme mohutný hukot vodopádov..."              ', 132, 3.92, 51),
	(11403, 'Pri štyroch prostitútkach zastaví bavorák, stiahne okno, vystrčí sa z neho ukazovák a ukazuje na ne:\r\n”Ty, ty a ty.”\r\n”A čo ja?” ozve sa štvrtá.\r\n”Áno, ty tiež, všetky ste šľapky!”              ', 221, 3.62, 51),
	(11404, 'Blázni sa rozprávajú:\r\n”Pozri sa aký je tu múr. Ak je vysoký, podlezieme, ak nízky, tak preskočíme.”\r\nDruhý sa zadychčaný vráti a vraví:\r\n”Z úteku nebude nič, tu nie je nijaký múr.”              ', 221, 4.2, 51),
	(11405, 'V blázinci:\r\n”Počujte, prečo vy všetkým hovoríte, že ste Napoleon Bonaparte a mne tvrdíte, že ste Ľudovít XVI?”              ', 140, 3.75, 51),
	(11406, 'Malý Jožko kričí cez celý dvor:\r\n”Tato, sliepky prdia!”\r\nOtec mu odpovedá:\r\n”Nie, Jožko, v kuríne je stará mama.”              ', 144, 4.17, 51),
	(11407, 'Príde chlapík s pekne rozbitou hlavou k doktorovi:\r\n- Čo sa vám, stalo?\r\n- Ale tak si stojím a zrazu oproti mne raketa a prásk priamo do hlavy. Oklepem sa a zrazu prasa a prásk priamo do hlavy. Otvorím oči a oproti mne kôň a rach do hlavy. Padol som na zem. Vstávam a zrazu lokomotíva a prásk priamo do hlavy. Strašné rany!\r\n- Raketa, prasa, kôň, lokomotíva, - brble si doktor a vypisuje sprievodku na psychiatriu, - bolo tam ešte niečo?\r\n- Hej, potom prišiel nejaký chlap a ten kolotoč vypol!              ', 531, 3.33, 51),
	(11408, 'Chlapík príde do baru a vraví barmanovi: \r\n"Vieš, nemám prachy, ale za jedno pivo Ti ukážem taký trik, na ktorý do smrti nezabudneš." \r\nBarman len pokrúti hlavou, ale prinesie mu pivo. Chlapík z jedného vrecka vytiahne potkana a z druhého ropuchu. Potkan okamžite pricupitá k barovému pianu a na klávesách vylúdi známu pesničku. Žaba chytí melódiu a začne perfektne spievať. Celý podnik žasne, k chlapíkovi hneď pribehne jeden zákazník a ponúkne mu rovnú tisícku za tú žabu. Chlapík súhlasí, vezme prachy a objedná jedno pre seba a jedno pre barmana. Ten mu hovorí: \r\n"Človeče, tú žabu si nemal predať! Tá ti mohla zarobiť iné prachy."\r\nChlapík len mávne rukou: \r\n"Tá žaba je úplne sprostá, ale potkan je bruchomluvec."               ', 791, 4.22, 51),
	(11409, 'Do baru vôjde kôň, zamieri k pultu, sadne si a objedná si whisky. Vyjavený \r\nbarman mu naleje a hneď uteká zavolať svojmu známemu riaditeľovi cirkusu: \r\n"Človeče, musíš sa sem hneď prísť pozrieť! Mám tu hovoriaceho koňa!"\r\nRiaditeľ neváhal a za chvíľku už sedel v bare vedľa koňa. Hneď \r\nzačal do neho hustiť: "Kamarát, nešiel by si robiť ku mne do \r\ncirkusu? Trhli by sme pekné prachy!"\r\n"Cirkus, to je ten veľky stan, čo má v strede pieskom vysypanú \r\nplochu, po ktorej sa musi behať dokola?"\r\n"Áno."\r\n"Tak to neberiem. Čo by ste tam robili s programátorom?"              ', 616, 4, 51),
	(11410, 'Príde chlapík do krčmy a vidí, že tam nie je ani noha. Tak si sadne k baru a povie majiteľovi, že by mal preňho perfektný nápad, ako zvýšiť návštevnosť. Majiteľ súhlasí, tak chlapík vytiahne takú plechovú krabicu a na ňu postaví kačicu v klobúku. Po chvíľke kačica začne tancovať na špičkách. Majiteľovi sa to strašne páči a za päť litrov odkúpi od chlapíka krabicu aj s kačicou. Do druhého dňa sa novinka rozkríkne a každý sa príde pozrieť. Krčma je nabitá do prasknutia. Zase príde ten chlapík a baví sa s majiteľom: \r\n"Tak čo, spokojnosť?" \r\n"Hej, hej, je to príma. Len mi ešte povedzte, ako to máme urobiť, aby tá kačica prestala tancovať?" \r\n"To je jednoduché. Stačí otvoriť tú krabicu a sfúknuť tie sviečky vo vnútri."              ', 812, 3.64, 51),
	(11411, 'V jednom meste má prednášku známy sexuológ. Okrem iného príde reč aj na to, ako často by sa malo súložiť.\r\n “Urobím taký malý prieskum.” Hovorí doktor obecenstvu. “Kto súloží každý deň, nech zdvihne ruku.” V sále sa zdvihne asi tak polovica rúk. “Výborne. Kto súloží raz za týždeň?” Opäť sa zdvihne veľké množstvo rúk. “Skvele a kto súloží raz za mesiac?” Nesmelo, ale predsa sa zdvihne pár rúk. “No, to je už horšie. A nájde sa niekto, kto súloží len raz do roka?” Sála zmĺkne a iba vzadu je vidieť mávajúcu ruku a počuť radostné výkriky. “Tu, ja!” Doktor sa zamyslí a hovorí: “No, to je dosť zlé, nechápem prečo sa tak radujete?” A chlapík natešene kričí: “Už zajtra! Už zajtra!”              ', 796, 3.73, 51),
	(11412, 'Príde muž do baru na najvyššom poschodí mrakodrapu. Vyzerá to tam slušne, tak si sadne, objedná si a dá sa do reči s chlapíkom, ktorý sedí vedľa.\r\n- Som tu prvýkrát, stojí to tu za to?\r\n- Áno, ja som tu stále. Je to vážne mimoriadne miesto.\r\n- V čom?\r\n- Vidíš tamto okno? To tretie zľava? Vietor tu naráža do steny budovy takým zvláštnym spôsobom, že keď vyskočíš, preletíš sotva pár metrov a hodí ťa to naspäť.\r\n- Ale to predsa nie je možné.\r\nChlapík, namiesto odpovede vstane, otvorí okno a vyskočí. A naozaj, preletí sotva desať metrov, zastaví sa vo vzduchu a vletí oknom späť dovnútra.\r\n- Je to sranda, mal by si to skúsiť. - vraví mužovi.\r\nTen najprv zaváha, ale nakoniec predsa skočí. Desať metrov, dvadsať, tridsať, päťdesiat... a bum, rozmláti sa na chodníku. Barman sa nakloní k chlapíkovi a prehodí:\r\n- Počuj, Superman, ty keď si vypiješ, si vážne poriadna sviňa!\n', 954, 3.5, 51),
	(11413, 'Na lavičke v parku spí bezdomovec. Zobudí ho mladá pani a pýta sa:\r\n- Prosím vás, neviete koľko je hodín?\r\n- Neviem, nemám hodinky!\r\nO tri hodiny ho zobudí skupinka chlapcov a pýta sa:\r\n- Hej bezďák, nevieš koľko je teraz asi hodín?\r\n- Neviem!!!\r\nPrejde chvíľka a príde mladý študent a opäť sa pýta:\r\n- Prosím vás, mladý pán, neviete koľko je hodín?\r\n- Neviem nič. Už ma stále nebuďte.\r\nBezdomovec sa naštve a na kus kartónu napíše: "NEVIEM KOĽKO JE HODÍN"\r\nO pol hodiny ho zobudí stará babička a povie:\r\n- Pane, pol ôsmej!', 568, 3.88, 51),
	(11414, 'Príde eskimák do hotela v Egypte a pýta sa recepčného:- Máte jednu voľnú izbu?\r\nA recepčný na to :- Nie, nemáme!\r\nA eskimák povie: - A chladnička by sa nenašla?', 174, 3.06, 51),
	(11415, ',,Môj pes klame." ,,Neverím." ,,Ale áno. Dávaj pozor! Rexo, ako robí mačka?" ,,Hav Hav!" ,,No vidíš, čo som ti hovoril?"', 129, 3.67, 51),
	(11416, 'Cestári robia cestu cez les, proti čomu sú zvieratká žijúce v lese. Rozhodnú sa teda poslať na úrad niekoho, kto vybaví pozastavenie stavby. Vyberú spomedzi seba najsilnejšieho, teda medveďa. Ten sa vráti rýchlo spať, pretože nič nevybaví. Potom pošlú prefíkaný líšku, tá sa však tiež rýchlo vráti a nič nevybaví. Nakoniec sa prihlási somár, ktorému ho zvieratá vysmejú: "Čo ty, ty nič nevybavíš." Somár aj tak ide, vráti sa a zvieratá sa pýtajú: "Tak čo, vybavil si?" Somár im vraví: "Vybavil, všetko som vybavil tak ako ste chceli." Zvieratá neveriacky krútia hlavou a pýtajú sa somára ako to dosiahol. "No, hovorí somár, otvorím prvé dvere, tam kolega, otvorím druhé dvere, tam kolega, otvorím tretie dvere a tam tiež kolega."', 792, 3.77, 51),
	(11417, 'Jedna žena má dvoch psov: Remsu a Pose. Raz jej ujdú na lúku a ona za nimi: Poseremsa.', 90, 2.38, 51),
	(11418, 'Dva kamene sa hrajú na štrk.', 30, 3.73, 51),
	(11419, '- Čo si dáte? Máme mačacie nožičky, psie steaky...\r\nŽena sa zhrozí:\r\n- Ježkove oči!\r\n- Výborná voľba, madam.', 121, 4.07, 51),
	(11420, 'Je to oranžové, guľaté a začína to na P. Čo je to? Pomaranč.Je to oranžové, guľaté a začína to na N. Čo je to? Neuveriteľné, zasa pomaranč!', 157, 3.29, 51),
	(11421, 'Na strome sa rozprávajú dve čerešne: "- Prečo sa smeješ?"- "Lebo máš vonku červíka."\r\n', 96, 3.38, 51),
	(11422, 'Češi, Slováci, Poliaci a Rusi idú do lietadla.\r\nNo po chvíli za nimi príde letuška: "Prepáčte, ale sme veľmi ťažký niekto musí vyskočiť. Tak sa postavia 4Češi a vravia: "Sme Česi? Sme. Sme silný? Sme. Tak vyskočíme." \r\nPo chvíli príde zasa letuška a vraví: "Prepáčte, ale furt sme tažký. Tak idú Poliaci. Postavia sa a vravia: "Sme Poliaci? Sme. Sme silný? Sme. Tak vyskočíme."\r\nNo po chvíli príde zasa letuška a hovorí: "Je nám to ľúto, ale stále sme ťažký a klesáme." Postavia sa Slováci a vravia: "Sme Slováci? Sme. Sme silný?  Sme. Tak vyhodíme Rusov."\r\n', 608, 3.71, 51),
	(11423, 'Mladý frajerský pilot prvýkrát v živote pristáva v noci. Namiesto obvyklého ohlásenia sa dispečerovi ozve z vysielačky: "Hádaj kto!".Dispečer vypne osvetlenie na pristávacej dráhe letiska a odpovie: "Hádaj kde!!\r\n', 228, 4.11, 51),
	(11424, 'Viete čo znamená ČSAD?Čakajte somári autobus dôjde.', 57, 3.98, 51),
	(11425, 'Viete aký je rozdiel medzi Japonskom a Slovenskom?Japonsko je krajina úsmevu a my sme krajina na smiech.', 106, 3.57, 51),
	(11426, 'Matka so synčekom idú po ulici a oproti nim ide jednoruký, jednooký, hrbatý muž na vozíčku. Malý sa otočí k mame a pýta sa: "Mami, a toto je aký pokémon?"', 168, 3.87, 51),
	(11427, 'Traja stroskotanci sa ocitli na ostrove, na ktorom je zázračná diera, do ktorej kto skočí a povie kde chce byť, dostane sa tam.Ide prvý, rozbehne sa a povie: "Chcem byť doma" a ocitne sa doma.Ide druhý, rozbehne sa, skočí a povie: "Chcem byť tiež doma" a je doma.Ide tretí, rozbehne sa, potkne sa o kameň a povie: "Do pi.i.".', 340, 3.66, 51),
	(11428, 'Vieš aký je rozdiel medzi svokrou a cibuľou??Keď krájaš svokru, tak neplačeš.', 85, 4.14, 51),
	(11429, 'Príde kostra do mäsiarstva a predavač sa jej pýta: Čo to bude mladá pani?\r\nAle nič, len sa pozerám, čo sa teraz nosí...', 129, 3.29, 51),
	(11430, 'Chuck Norris kope rýchlejšie ako elektrina.', 45, 3.73, 51),
	(11431, 'Sedí dievčatko na lavičke a nadáva.\r\nPríde babka a hovorí: Čo tak nadávaš.\r\nPrisadnite si a pošepkám vám...\r\nBabka si prisadne a tiež začne nadávať.\r\nPríde dedko a pýta sa: A vy dve čo tak nadávate??? \r\nBabka: Prisadni si a poviem ti...\r\nDedko sadne a babka mu vraví: Tá lavička je čerstvo natretá...', 325, 4.29, 51),
	(11432, 'Viete čo je to drzosť??Keď si prdnete na pohrebe a zvalíte to na mŕtveho.', 78, 3.87, 51),
	(11433, 'Viete čo znamená ZRPŠ?\r\nZajtra ráno podpálime školu.', 58, 3.45, 51),
	(11434, 'Ide mama so svojím koktavým synčekom na Eifelovú vežu. Na 130-tom poschodí syn vraví: "Ku ku ku...", a v tom ho mamička upozorní: Nenadávaj!" \r\nIdú ďalej a na 150 poschodí opäť synček vraví: "Ku ku ku...", mamička ho však opäť zahriakne. \r\nKeď už sú úplne hore, synček dopovie vetu: "Ku ku kufre som zabudol na prízemí...."', 351, 3.47, 51),
	(11435, 'Synak, hádaj čo som ti priniesol zo služobnej cesty?\r\n- Nič.\r\n- Beťár jeden, zase uhádol!  ', 98, 4.27, 51),
	(11436, 'Padol facebook. \r\nUž je tomu dva dni...\r\nĽudia s plačom v zúfalosti vybehli na ulicu a so slzami v očiach, v ruke držiac svoje fotografie kričia: Páči sa ti to ? No tak, páči...??? ', 192, 3.85, 51),
	(11437, 'Východniar sedí v lietadle:\r\n> Znace co, ja mám také neščesce, dze som, tam še takoj coškaj staňe..."\r\n> Z reproduktora sa ozve:\r\n> Lietadlo má poruchu a havaruje, keďže sme nad morom, každý pasažier dostane píštaľku na odháňanie žralokov..."\r\n> Východniar začne lamentovať:\r\n> Uvidzice, budz vyfasujem píščalku bez džúrky, abo natrafím na hluchoho žraloka...', 390, 4.24, 51),
	(11438, 'Viete aký je rozdiel medzi šampónom a debilom?\r\nŽiadny. Obidvaja sú na hlavu.', 82, 3.2, 51),
	(11439, 'Spolužiaci skončia vysokú školu a jeden z nich hovorí:\r\n- Chlapi, každých 10 rokov sa budeme stretávať, dobre?\r\nStretávka po 10tich rokoch: \r\n- Chlapi, kde ideme?\r\nDo Zlatého orla, tam čapujú dobré pivo.\r\n Stretávka po 20tich rokoch: \r\n- Chlapi, kde ideme?\r\n- Do Zlatého orla, tam nie sú schody.\r\n Stretávka po 30tich rokoch: \r\n- Chlapi, kde ideme?\r\n- Do Zlatého orla, tam dobre varia.\r\n Stretávka po 40tich rokoch: \r\n- Chlapi, kde ideme?\r\n- Do Zlatého orla, tam sú krivé stoly.\r\n Stretávka po 50tich rokoch: \r\n- Chlapi, kde ideme?\r\n- Do Zlatého orla, tam sme ešte neboli.\r\n', 600, 3.89, 51),
	(11440, 'Ťava ide po púšti a stretne agenta 007.\r\nAgent sa slušne pozdraví:\r\n– Bond. James Bond.\r\nA ťava odpovie: – Bloud. Velbloud.\r\n', 135, 3.96, 51),
	(11441, 'Ficek príde neskoro do úradu.\r\n- Prepáčte, pán vedúci, za malé oneskorenie, ale bolo to z vážnych rodinných dôvodov...\r\n- Z akých?\r\n- Pán šéf, dnes som sa stal otcom!\r\nPrísna tvár sa rozplynie do úsmevu.\r\n- Gratulujem! A je to chlapec alebo dievča?\r\n- To, prosím, budem vedieť až o deväť mesiacov!', 321, 3.01, 52),
	(11442, 'Rozprávajú sa dvaja manažéri:\r\n- Ešte stále ťa tvoja sekretárka oslovuje "pán riaditeľ"?\r\n- Nie, už mi priamo hovorí "idiot".', 137, 2.81, 52),
	(11443, 'Vieš aký je rozdiel medzi ťavou a človekom?\r\nŤava vydrží 10 dní nepiť a pracovať a človek naopak.', 108, 3.15, 52),
	(11444, 'Sťažuje sa riaditeľ svojmu namestnikovi:\r\n- Sekretárka mi hovorí "môj dobrý veľký macko".\r\n- To je od nej rozkošn0 - pritakáva namestnik.\r\n- Myslíš? Aj na porade pred všetkými zamestnancami?', 205, 3.2, 52),
	(11445, 'Muž pracujúci v pohrebnej službe sa vráti neskoro večer domov úplne zničený a unavený.\r\n- Kde si preboha toľko bol? - pýta sa žena. Veď si vravel, že prídeš najneskôr o tretej.\r\n- Ale, ani sa nepýtaj. Pochovávali sme jedného známeho operného speváka a ten mal taký aplauz, že sme ho museli trikrát vyhrabávať.', 337, 3.49, 52),
	(11446, 'Stretnú sa dvaja manageri:\r\n- Čo sa ti stalo? Vyzeráš byť smutný.\r\n- Ale, žena mi našla novú sekretárku.\r\n- A akú? Blond, brunetku alebo čiernovlásku?\r\n- To je jedno, vlasy si zafarbi, ale je škaredá.', 215, 2.96, 52),
	(11447, 'Riaditeľ sa pýta sekretárky:\r\n- Slečna, počul som ako sekretárka môjho kolegu hovorí o svojom šéfovi, že je síce dobrý, ale inak je starý, škaredý a hlúpy. Aj vy si to myslíte o mne?\r\n- Ale pán riaditeľ, to by som si nedovolila, vy ste predsa tiež dobrý!', 276, 2.83, 52),
	(11448, '- Tak som prišla na to, že papier na výplatné pásky sa vyrába z cibule. Kedykoľvek sa na tú moju pozriem, mám slzy v očiach!', 134, 2.94, 52),
	(11450, 'Do firmy príjmu nového zamestnanca a majster ho hneď vezme do prarády:\r\n- Tak mladý, tu máš metlu a pôjdeš zamiesť halu.\r\n- Ale ja som inžinier?! - hovorí nováčik.\r\n- Aha! -škriabe sa majster za uchom. Tak ja ti to ukážem.', 239, 3.74, 52),
	(11451, 'V jednej novej slovenskej firme sa na nástenke objavil oznam vedenia :\r\n- Váš plat je vaša osobná vec, a nemusíte preto nikomu vešať na nos, koľko u\r\nnás zarábate!\r\nPo niekoľkých dňoch bolo na ozname dopísané :\r\n- Sľubujem, že svoj plat nevyzradím nikomu na svete. Za ten plat sa hanbím\r\ntakisto ako vedenie firmy.', 334, 3.16, 52),
	(11452, 'V českom úrade vraví šéf sekretárke:\r\n- Pište, schůze bude v pondělí.\r\n- Jaké i se píše v pondělí?\r\n- Tak pište, schůze bude v ůterí.\r\n- Jaké i se píše v ůterí?\r\n- Hergot, napíšte to na středu!', 220, 3.08, 52),
	(11453, 'Peter povie Dežovi:\r\n- Namaľuj okná!\r\nPeter je v záhrade už dve hodiny, a Dežo sa neozýva. Za chvíľu Peťo počuje otázku:\r\n- Peter, aj rámy?', 152, 3.19, 52),
	(11454, 'Viete, ako má vyzerať názorová vyhranenosť "štátneho úradníka" tak, aby prežil všetky režimy? Nie?\r\nNa otázku \'Aký máte na uvedenú vec názor?\' vždy odpovie \'Ja zásadne nesúhlasím so svojim názorom!\'.', 221, 3.03, 52),
	(11455, 'Jano sa pýta Deža:\r\n- Za koľko robíš?\r\n- Koruna na hodinu.\r\nJano zhrozený naňho pozerá a hovorí:\r\n- Čo ti šibe za tak málo?\r\n- Milión hodín, milión korún.', 170, 3.12, 52),
	(11456, 'Viete, čo urobí cigáň, keď mu poviete, že musí ísť pracovať?\r\nNájde si v slovníku cudzích slov slovo práca.', 121, 2.99, 52),
	(11457, 'Hovorí šéf čašníkovi:\r\n- Človeče, uvedomte si, že tu nemôžete vyhadzovať opitých hostí na ulicu. Veď už druhý mesiac pracujete v reštauračnom vozni!', 167, 3.59, 52),
	(11458, 'Špinavý robotník si sadne na koľajnice a hovorí:\r\n- Ja mám ale špinavé nohy. Hmm, nemám.', 97, 2.99, 52),
	(11459, 'V práci vždy zo seba vydajte 100%!\r\n- 12% v pondelok\r\n- 23% v utorok\r\n- 40% v stredu\r\n- 20% vo štvrtok\r\n- 5% v piatok\n\r\nA pamätajte si:\r\nKeď máte skutočne blbý deň a vyzerá to, že vás chcú všetci nasrať, pamätajte si, že potrebujete 42 svalov na zamračenie ale iba 4 na to, aby ste natiahli prostredník a poslali ich do zadku.', 345, 3.35, 52),
	(11460, 'Zamestnanec príde za šéfom a hovorí:\r\n- Šéfe, musíte mi zvýšiť plat. Musím vám prezradiť, že tri ďalšie firmy majú o mňa záujem.\r\n- Nehovorte a ktoré sú to?\r\n- Daňový úrad, telekomunikácie a elektrárne.', 228, 3.18, 52),
	(11461, 'Nové Slovenské príslovie:\r\n\'Komu sa nelení , tomu sa čudujem.\'', 67, 3.51, 52),
	(11462, 'Príde opravár do veľkej budovy kde sa pokazil záchod a recepčnej sa pýta : \r\n"No tak kde je ten hajzel?" \r\n"Pán riaditeľ je práve na poshcodí." \r\n"Ale vy ste ma zle pochopili ja myslím tie dve nuly."\r\n"Ah áno, námestkovia sú na porade."  \r\n"Ale nie ja myslím to kde sa robí hovno."\r\n"Účtáreň je pod nami."', 325, 3.51, 52),
	(11463, 'Stretnú sa dvaja Rómovia: Dežo a Fero.\r\n- Oj, ale som uťahaný.\r\n- A z čoho?\r\n- Z roboty.\r\n- Hej a kde robíš?\r\n- Ta v kameňolome.\r\n- Hej a od kedy?\r\n- Ta od zajtra.', 172, 3.21, 52),
	(11464, 'Pracujú dvaja chlapi na vysokej budove a počujú sanitku. Jeden hovorí: \r\n- To je výkon, nie je to ani 5 minút, čo mi spadlo na ulicu kladivo a sanitka už je tu!', 168, 2.9, 52),
	(11465, 'Sudca vchádza do súdnej siene a hneď od vchodu prerečie. \r\n- Obžaloba mi dala 300 000, aby som rozhodol v jej prospech. Obhajoba mi dala 200 000, aby som rozhodol v jej prospech. Vraciam teda obžalobe 100 000, aby som bol korektný.', 238, 3.16, 52),
	(11466, 'Príde muž do hotela, objedná si izbu a poprosí na recepcii, aby ho ráno zobudili o siedmej. \r\nMá totiž dôležité rokovanie. Ráno mu zazvoní  telefón : \r\n- Vy ste sa nechali zobudiť ráno na siedmu?\r\n- Áno.\r\n- Tak šup šup hore, už je jedenásť.', 261, 3.4, 52),
	(11467, '- Tak čo slečna, ste spokojná so svojim miestom? - pýta sa riaditeľ sekretárky.\r\n- Ale áno, pán riaditeľ, je to fajn, len popolník na stole ma trochu tlačí na kríže.', 179, 2.97, 52),
	(11468, '- Dva dni som kosil trávu a aby som urobil radosť aj susedovi, pokosil som mu zemiaky.', 88, 3.24, 52),
	(11469, 'Rozprávajú sa dvaja manažéri.\r\nPersonálny manažér: - Najväčšou hodnotou našej firmy sú zamestnanci!\r\nFinančný manažér: - Tak ich predajme!', 154, 2.94, 52),
	(11470, 'Hovorí podnikateľ svojmu zamestnancovi:\r\n- Vy ste, pán Novák, velká opora našej firmy. Neviem, ako by sme bez vás vydržali, ale v budúcom mesiaci to chceme skúsiť.', 174, 2.95, 52),
	(11471, 'Hovorí otec synovi:\r\n"Syn môj, desať rokov som pracoval vo Vietname." \r\nSyn na to smutne sklopil hlavu. Otec pokračuje:\r\n"Potom som dvadsať rokov pracoval v Černobyle."\r\nA syn smutne sklopil aj druhú hlavu.', 213, 3.29, 52),
	(11472, 'Pred fabrikou protestuje dav ľudí.\r\n- My chceme prácu, my chceme prácu...\r\nZrazu z fabriky vyjde šéf, zastaví sa, zamyslí a ukáže na jedného z protestujúcich.\r\n- Ty! Si naspäť prijatý. Máš prácu.\r\n- Do riti, prečo práve ja?', 243, 2.89, 52),
	(11473, 'Príde robotník na stavbe za majstrom:\r\n- Majster, potreboval by som olej.\r\n- A načo ?\r\n- Môj fúrik vŕzga. Robí že "eee........eee.......eee.......eee"\r\n- Fajn, ste prepustený.\r\n- Čože ??!! Veď som chcel iba malé zlepšenie ??!!\r\n- Môže byť, ale u nás škrípajúce fúriky robia "ee..ee..ee..ee..ee..ee"', 320, 3.21, 52),
	(11474, 'Ďakujeme našej firme za to, ako nás platí. Zachránila nám tým život. Veď čo keby sme dovolenkovali na Srí Lanke?', 123, 3.03, 52),
	(11475, '- Dežo, kde robíš?\r\n- No, na bani.\r\n- A čo tam robíš?\r\n- Banujem, banujem.', 80, 2.91, 52),
	(11476, 'Robotníci na stavbe stavajú brutálne vysoký komín. Už ho majú skoro hotový, keď k ním zrazu pribehne zadýchaný majster a hovorí: \r\n- Chlapi, prúser! Niekto mi otočil stavebný plán. My sme mali studňu kopať!', 225, 3.34, 52),
	(11477, 'Dvaja robotníci sa zhovárajú na stavbe: \r\n- Ty vidíš tú muchu na konci lešenia? \r\n- Akú muchu? \r\n- Chlapi, končíme, je zlá viditeľnosť.', 148, 3.45, 52),
	(11478, '- Vieš čo je nové? Zrušili daňový úrad!\r\n- Neblázni!\r\n- Naozaj! Dostal som od nich list a v ňom stálo: Posledná upomienka!', 133, 3.1, 52),
	(11479, 'Zamestnávateľ pri vybavovaní žiadosti o výpoveď hovorí zamestnancovi:\r\n- Tak to ste dlho u nás nevydržali! Iba týždeň a už odchádzate?!\r\n- Nevydržal som dlho, ale veľa!!!', 186, 2.81, 52),
	(11480, 'Hovorí šéf zamestnancovi:\r\n- Zdá sa mi, že dnes nemáte žiadnu chuť do práce!\r\n- Mám, ale človek sa musí vedieť ovládať.', 134, 2.82, 52),
	(11481, 'Dvaja učni stoja pri dverách a jeden z nich cez kľúčovú dierku pozerá, ako majster súloží s manželkou. Ten, ktorý nepozerá, sa pýta:\r\n- Je to dobré čo robí majster?\r\nPozerajúci mu odpovie:\r\n- Samozrejme, v opačnom prípade by to dal robiť nám.', 264, 3.13, 52),
	(11482, 'Paradox kapitalizmu:\r\nVäčšina našich ľudí musí viac a viac pracovať, aby menej dostávala.', 98, 3.13, 52),
	(11483, 'Keby sme sa dnes riadili socialistickým heslom "Kto nepracuje, nech neje", polovica Slovákov by nám vymrela od hladu.', 120, 2.95, 52),
	(11484, 'Čo je úspech:\n\r\nVo veku   3 ......... Úspech je........ ak nenakakáš do plienok.\r\nVo veku  12......... Úspech je........ ak máš  priateľov.\r\nVo veku  16......... Úspech je........ ak máš vodičák.\r\nVo veku  20......... Úspech je........ ak máš sex.\r\nVo veku  35......... Úspech je........ ak máš prachy.\r\nVo veku  50......... Úspech je........ ak máš prachy.\r\nVo veku  60......... Úspech je........ ak máš sex.\r\nVo veku  70......... Úspech je........ ak máš vodičák.\r\nVo veku  75......... Úspech je........ ak máš priateľov.\r\nVo veku  80......... Úspech je........ ak nenakakáš do plienok.', 626, 3.79, 52),
	(11485, 'Šéf sa pýta sekretárky:\r\n- Koľko je hodín, Elenka?\r\n- Koľko poviete, pán riaditeľ.', 91, 2.94, 52),
	(11486, 'Ako dostaneš pomocou vody svetlo?\r\nUmyjem okno.', 48, 2.99, 52),
	(11487, 'Rušňovodičovi:\r\n"Preboha, ako ste to išli s tým vlakom, keď ste sa s nim vykoľajili do kukurice?"\r\n"Ale, normálne som išiel po koľajách a zrazu vidím rovno naprostriedku Rusa."\r\n"Tak ste ho mali zraziť!"\r\n"Veď som chcel, ale ušiel mi do kukurice!"', 262, 3.94, 52),
	(11488, 'Mal som brata.\r\nBol kuchárom.\r\nDostal sa až do ponorky.\r\nPripálil cibuľu.\r\nChcel vyvetrať.\r\nUž nemám brata.', 114, 2.96, 52),
	(11489, '- Myslíte, že za neúspechom vašej firmy sa skrýva nevedomosť, alebo nezáujem pracovnikov?\r\n- Neviem a keď mám pravdu povedať ani ma to nezaujíma. ', 157, 2.93, 52),
	(11490, 'Strašná zima. V parku chlapík venčí obrovského buldoga. Idú okolo lavičky, na nej sedí bezdomovec a celý sa trasie.\r\n"Tak čo, zima je ti, zima?"\r\n"Ej, veru zima."\r\n"A chceš niečo na zohriatie?"\r\n"Nuž keď máte."\r\n"Azor, ber ho!"', 243, 3.12, 52),
	(11491, '- Vy somár akýsi. Practe sa mi z úradu, nech vás tu už viac nevidím!\r\n- Pán riaditeľ, ak ihneď´neodvoláte tú urážku, dám výpoveď !', 147, 3.52, 52),
	(11492, 'Šéf hovorí sekretárke:\r\n- Príďte, prosím, dnes večer ku mne domov, porozprávame sa o vašich prémiách.\r\n- Ale pán riaditeľ, na túto tému sme sexovali minulý týždeň.', 183, 3.08, 52),
	(11493, 'Stretnú sa dvaja burzoví makléri vo fitness centre:\r\n- Čo posiluješ?\r\n- Dnes britskú libru.', 97, 3.38, 52),
	(11494, '- Oh, chcel by som mať plat 30000 korún ako môj otec.\r\n- Čo? Tvoj otec zarába 30000 korún!?\r\n- Nie, ale tiež by chcel. ', 126, 3.29, 52),
	(11495, 'Zamestnanec vyčíta svojmu šéfovi:\r\n- Prepáčte, ale mám nízky plat!\r\n- Prepáčim.', 89, 3.18, 52),
	(11496, 'Vyfajčená cigareta skracuje život o dve minúty. Vypitá fľaška piva o štyri minúty. Pracovný deň o osem hodín.', 121, 2.96, 52),
	(11497, 'Zišli sa traja remeselníci a hádali sa, ktoré povolanie je najstaršie. Prvý vraví: \r\n- Ja som murár a moje remeslo je najstaršie, lebo ja som v Egypte staval pyramídy.\r\nDruhý vraví: \r\n- To nie je pravda. Ja som tesár a moje remeslo je najstaršie, lebo ja som vyrezával Noemovu archu.\r\nA tretí vraví: \r\n- To je nič. Ja som elektrikár a moje remeslo je najstaršie, lebo keď Boh povedal "A bude svetlo!", my sme už museli mať naťahané káble.', 464, 2.92, 52),
	(11498, 'Žatva. Vybehne týpek s kombajnom na pole, obzrie sa, chytí sa dlaňou za čelo a vykríkne:\r\n- Ježišmáriajozef, však ja som zabudol zasiať.', 147, 3.25, 52),
	(11499, 'Chlapík je prvý deň v novej práci. Zdvihne telefón vytočí číslo a zreve:\r\n- Dones mi jednu kávu ale rýchlo do riti!\r\nZ telefónu sa ozve:\r\n- Čo si to dovoľujete? Viete vôbec s kým sa rozprávate?\r\n- Nie. Neviem.\r\n- Ja som riaditeľ tejto spoločnosti, vy idiot!\r\n- A viete vy s kým sa rozprávate, vy idiot?\r\n- Nie. - odpovedá riaditeľ.\r\n- To je dobre. - povie chlapík a zloží slúchadlo.', 409, 3.61, 52),
	(11500, 'Viete v akej dobe žijeme? No predsa v elektrickej. Do práce chodíme s odporom, v práci sedíme v napätí a keď požiadame o zvýšenie platu, tak nás kopnú do zadku.', 173, 3.23, 52),
	(11501, 'Koktavý majster a jeho učeň išli kuť krompáč.\r\n- Ttty budeš kk kk kkuť a jja ti ti p ppoviem, kkedy dd dd ddosť - hovorí majster.\r\nPo desiatich minútach kovania spustí majster:\r\n- Dd dd  do ddo ddo do riti, kuj ďalej bude lopata!', 243, 3.09, 52),
	(11502, 'Robotníci stavajú vysoký komín. Odrazu k mím pribehne majster a rozrušne hovorí:\r\n- Prúser chlapi, prúser!!! \r\n- Aký prúser? Hodíme dve tehly a končíme?\r\n- Nie, vačší prúser. Niekto mi obrátil plány. My sme mali studňu kopať!', 247, 3.33, 52),
	(11503, 'Dlho sme sa na tej šéfovej anekdote smiali, než sme pochopili, že je to pracovná úloha.\n', 94, 3.32, 52),
	(11504, 'Ako sa číta výplatná páska?\r\nHm... hm... hm... hm... hm... hm? Hmm!... no do riti!', 87, 3.02, 52),
	(11505, 'Bol som riaditeľom jedného veľkého koncernového podniku. Kávu mi varila sexi sekretárka, do práce som jazdil Tatrou 613. Raz za mnou prišli, aby som zaplatil 5 000 korún na pohreb člena ÚV KSČ. Povedal som, že za 5000 pochovám celý ÚV sám. \r\nOd tej doby som pracoval ako riaditeľ malého podniku. Kávu mi varila stará sekretárka, do práce som jazdil Tatrou 603. Raz mi vyčítali, že som nebol na poslednej schôdzi KSČ. Povedal som, že keby som vedel, že je naozaj posledná, prišiel by som s transparentom. \r\nOd tej doby som robil majstra. Do práce som jazdil vlastným autom, kávu si varil sám. Na stene som mal obraz Husáka a Lollobrigidy. Povedali mi, aby som tú kurvu zvesil. \r\nZvesil som Husáka a odvtedy som  pracoval vo výkope. Do práce som jazdil na bicykli a kávu som si nosil v termoske. Keď som kopal, prišli za mnou, aby som si bicykel schoval, že pôjde tadiaľ sovietska delegácia. Povedal som, že bicykel mám zamknutý a poistený. \r\nOd tej doby som nezamestnaný.', 1024, 3.66, 52),
	(11506, 'Riaditeľ sa pýta sekretárky:\r\n- Prosím vás, aký deň máme dnes?\r\n- Služobné piatok a súkromne neplodný.', 114, 3.11, 52),
	(11507, 'Sekretárka vraví riaditeľovi:\r\n- Pán riaditeľ, prišla Vám SMS-ka.\r\nRiaditeľ na to:\r\n- Nech vojde.', 105, 2.97, 52),
	(11508, '- Pani, kde je oddelenie kníh samovrážd?\r\n- Tam v rohu.\r\n- Ďakujem. Ale tam je prázdny regál.\r\n- No vidíte. Ľudia si požičajú a nevrátia.', 149, 3.3, 52),
	(11509, 'Zamestnanec príde za šéfom a hovorí:\r\n- Šéfe, musíte mi zvýšiť plat. Tri ďalšie firmy majú o mňa záujem.\r\n- Nehovorte, a ktoré sú to?\r\n- Daňový úrad, telekomunikácie a elektrárne.              ', 215, 4, 52),
	(11510, 'Viete, aký je rozdiel medzi svedkom, znalcom a sudcom?\r\nSvedok videl, počul ale nevie.\r\nZnalec nevidel, nepočul, ale vie.\r\nSudca nevidel, nepočul, nevie, ale rozhoduje.              ', 186, 3.83, 52),
	(11511, 'Čašník sa pýta hosťa: \r\n"Máte prázdny pohárik, mám vám priniesť ďalší?" \r\n"A čo budem robiť s dvoma prázdnymi pohármi?"              ', 151, 4, 52),
	(11512, 'Príde šerif do salónu, vidí na zemi mŕtveho muža a tak sa pýta:\r\n- Hráč?\r\n- Áno.\r\n- Falošný?\r\n- Áno.\r\n- Poker?\r\n- Nie, husle.              ', 152, 3.5, 52),
	(11513, 'Mladý ale frajerský pilot ide na svoje prvé samostatné nočné pristátie. Namiesto obvyklého ohlásenia sa dispečerovi letiska zavalí do vysielačky: \r\n- Hádaj kto?\r\nDispečer vypne svetlá celej pristávacej dráhy a letiska a odpovie: \r\n- Hádaj kade?              ', 276, 3.57, 52),
	(11514, 'Mišo sa vezie v taxíku. Chce sa čosi taxikára spýtať a tak ho zozadu poklepe po pleci. Taxikár hrozne skríkne, strhne volant, odrazí sa autom od autobusu do najbližšieho výkladu. Mišo sa ospravedlňuje:\r\n"Prepáčte, ale netušil som, že také malé poklepanie po pleci, vás môže takto vydesiť."\r\n"Nikdy! Už mi to nikdy neurobte!", odvetí taxikár a dodá, "Viete, dnes som prvý deň v novej práci. Predchádzajúcich dvadsať rokov som jazdil s pohrebným vozom."              ', 500, 3.88, 52),
	(11515, 'Zamestnanec príde za šéfom a hovorí:\r\n"Šéfe, musíte mi zvýšiť plat. Tri ďalšie firmy majú\r\no mňa záujem."\r\n"Nehovorte, a ktoré sú to?"\r\n"Daňový úrad, telekomunikácie a elektrárne."              ', 216, 4, 52),
	(11516, 'Rozhovor dvoch zamestnancov:\r\n-Rob vtedy, keď tu je šéf.\r\n-Načo. Aj tak nevie čo robíme.              ', 108, 4, 52),
	(11517, 'Idú tri mníšky na dovolenku autom a dôjde im benzín. V diaľke zbadali benzínovú pumpu, ale chýba im nádoba. Tak prehľadajú celé auto a nájdu nočník. Tak prídu na pumpu natankujú do nočníka a idú naspäť. Ako tak lejú ten benzín z nočníka, ide okolo farár, pozerá na ne, zakrúti hlavou a povie:\r\n”No mníšky, vašu vieru tak mať.”              ', 378, 4.15, 52),
	(11518, 'Príde riaditeľ k sekretárke a vraví:\r\nEvička, čo robíte v sobotu?”\r\n”Nič, pán riaditeľ.”\r\n”Dobre, ale dnes je ešte len utorok!”              ', 162, 3, 52),
	(11519, 'Jeden pyrotechnik si z dovolenky priniesol nové tričko. Na prednú stranu si dal napísať: \r\n”Pracujem s výbušninami!”\r\nNo a na zadnú stranu si dal nápis: \r\n”Keď ma uvidíte utekať, snažte sa ma dobehnúť!”              ', 239, 3.57, 52),
	(11520, 'Gynekológ vybehne na schody pred budovu nemocnice, poobzerá sa,\r\nrozpaží doširoka rukami a radostne vykríkne: "KONEČNE TVÁRE!"              ', 148, 3, 52),
	(11521, '"Pán doktor, tak som po tých vašich práškoch konečne po dlhej dobe zaspal." oznamuje v ordinácii pán Bednár. \r\n"To ste boli radi, nie?"\r\n"Já áno, ale môjmu zamestnávateľovi sa to moc nepáčilo."               ', 224, 3.77, 52),
	(11522, 'Pýta sa hostinský svojej manželky: \r\n"Ty, Žaneta, písala si hosťom čiarky na tácku za každé pivo?"\r\n"Samozrejme, že písala!"\r\n"Tak to je dobre," pochvaľuje si hostinský, "ja tiež!"              ', 209, 3.97, 52),
	(11523, 'Čašník nesie zákazníkovi jedlo a prstom pridržiava mäso. Zákazník to vidí a hneď ho okríkne.\r\n”Čo to znamená, prečo máte prst na mojom rezni?”\r\n”To preto, aby mi už po tretí raz nespadol.”              ', 228, 4.17, 52),
	(11524, 'Pekná blond pokladníčka v supermarkete vraví vedúcemu, že potrebuje prestávku, aby sa mohla upraviť. Vedúci na to:\r\n”To je nezmysel, veď vyzeráte skvele.”\r\n”Nie, nie, potrebujem si upraviť make-up. Chlapi si začínajú kontrolovať drobné!”              ', 276, 4, 52),
	(11525, '„Pán hlavný, ten rezeň si objednávam už siedmy krát.“\r\n„To som rád, že vám tak chutí...“              ', 120, 3.87, 52),
	(11526, '”Čašník, prečo mám mokrý tanier?”\r\n”Prepáčte pane, ale to je vaša polievka.” \n', 95, 3, 52),
	(11527, 'Stretne sa tenista a mäsiar. Tenista hovorí:\r\n”Dnes som porazil Samprasa.”\r\nA mäsiar na to: \r\n”No a čo, ja porážam sám prasa každý deň.”              ', 168, 3.83, 52),
	(11528, 'Ako volá programátor o pomoc keď sa topí?\r\nF1, F1, F1!!!              ', 74, 3.25, 52),
	(11529, 'Dvaja farári sa rozprávajú:\r\n”Mne sú zo všetkých športovcov najsympatickejší bicyklisti.”\r\n”Prečo?”\r\n”Lebo sa starajú o svoje duše.”\n', 157, 3.71, 52),
	(11530, 'Dozorca s prosíkom hovorí v cele odsúdených na smrť: \r\n”Chlapi, keď sa vás budú zajtra pýtať na posledné želanie, povedzte, že chcete, aby mi zvýšili plat!”              ', 189, 3.67, 52),
	(11531, 'Programátor stretne na ulici pekné dievčatá a volá na ne:\r\n”Nazdar kočky! Máte ICQ alebo aspoň e-mail?”\r\n”Nemáme. Na čo by nám boli?”\r\n”To je škoda, mohli sme sa zoznámiť.”              ', 212, 3, 52),
	(11532, 'Jedného krásneho dňa šiel po ceste chlapík. Zrazu k nemu priskočila žaba a ľudským hlasom mu vraví:\r\n”Keď ma pobozkáš, premením sa na krásnu princeznú!”\r\nChlapík ju zodvihol a dal si ju do vrecka. Žaba teda prehovorila hlasnejšie:\r\n”Ak ma pobozkáš, zmením sa na krásnu princeznú a ostanem s tebou!”\r\nChlapík ju vybral z vrecka, usmial sa na ňu a vložil ju naspäť. Žaba teda začala kričať:\r\n”Ak ma pobozkáš, zmením sa na princeznú!!!”\r\nKeď sa to opakovalo ešte asi trikrát, žaba nevydržala a opýtala sa ho:\r\n”Čo si ty zač? Prečo ma nechceš pobozkať?”\r\nChlapík odpovedal:\r\n”Vieš, ja som softvérový inžinier. Ja nemám na ženskú čas. Ale hovoriaca žaba - to je super vec!”              ', 760, 4.29, 52),
	(11533, 'Sekretárka oznamuje americkému bankárovi:\r\n”Je tu nejaký pán a hovorí, že sa chce dozvedieť niečo o tajomstvách vašich úspechov.”\r\n”A je to novinár alebo niekto od polície?”              ', 209, 3.8, 52),
	(11534, '”Pán šéf, káva je taká zlá, že hostia nás chcú zbiť!”\r\n”Nebojte sa, Ferko, sme v presile!”              ', 122, 3.8, 52),
	(11535, 'Kričí vrchný na kapelníka:\r\n”A teraz zahrajte niečo veselé a bezstarostné!”\r\n”Prečo?”\r\n”Pretože nesiem účet k tamtomu stolu!”              ', 162, 4, 52),
	(11536, '”Čo ste vy za čašníka?” rozčuľuje sa majiteľ reštaurácie. ”Už zase ste rozbili pohár na šampanské! Dúfam, že to bol posledný!”\r\n”Nie, pán šéf, ešte máme tri!”              ', 205, 3.73, 52),
	(11537, 'Príde upratovačka do triedy a hovorí žiakovi, čo sedí v triede:\r\n”Kto má ten bordel po vás upratovať?”\r\nŽiak jej na to:\r\n”Mala si sa lepšie učiť.”              ', 181, 3.67, 52),
	(11538, 'Ide programátor o 18.00 z práce\r\na stretne šéfa, ktorý sa ho pýta:\r\n”Čo ty tak zavčasu? Zobral si si pol dňa dovolenky?”\r\n”Nie, len si skočím na obed.”              ', 184, 2.33, 52),
	(11539, 'Programátor v kostole:\r\n”V mene Otca i Syna i Ducha svätého. Enter.”              ', 89, 3.38, 52),
	(11540, 'Programátori majú pánsku jazdu. Vypili si a kecajú. Jeden sa chváli:\r\n”Minule som bol na diskotéke, zbalil som tam super babu. Peknú aj inteligentnú. Zobral som ju domov. Pokecali sme, dali sme si vínka, objal som ju, ona sa ku mne pekne pritúlila. Pobozkal som ju, ona mňa. Potom som ju posadil na klávesnicu, vyhrnul sukňu a...\r\n”Ty vole, ty máš doma počítač? No, rýchlo hovor, aký!”              ', 425, 3.54, 52),
	(11541, 'Doktor sa pozerá na faktúru za inštaláciu počítačovej siete:\r\n”Človeče, veď vy si rátate na hodinu ďaleko viac, než my!”\r\n”To je normálne. Vy, doktori, vystačíte so znalosťou jediného systému celý život, ale my sa musíme každý rok učiť nejaký nový systém.”               ', 308, 3.43, 52),
	(11542, 'Podnikateľ zastavil svoje nové BMW na chodníku pred svojím úradom. Samozrejme, nepozrie sa na cestu, otvorí dvere dokorán a akurát ide okolo Tatrovka a dvere mu odtrhne. Podnikateľ celý naštvaný kričí:\r\n”Ty blbec, kde máš oči, pozri, čo si mi spravil s mojím novým autom!”\r\nTatrovkár sa naňho pozrie a diví sa:\r\n”To, že nemáš dvere ti vadí, ale to, že ti odtrhlo tri prsty, to si si ani nevšimol?”\r\n”Preboha! Kde je môj mobil?”              ', 483, 4.18, 52),
	(11543, 'Predák chodí po stavbe a zbadá tatrovkára, ako spí opretý o koleso v tieni svojej Tatrovky. Naštve sa a zreve:\r\n”Človeče, za toto ste platený?”\r\nRozospatý tatrovkár vytreští oči:\r\n”Čože, za toto dostanem osobitný príplatok?”              ', 265, 3.75, 52),
	(11544, 'Rozprávajú sa dvaja zverolekári, ktorí práve dooperovali slona. Prvý hovorí:\r\n”Dnes nám to išlo skvele. Dokonca sme si tam nezabudli ani žiadne chirurgické nástroje.”\r\nDruhý hovorí:\r\n”Áno, nezabudli, ale kde je sestrička?”              ', 260, 3.2, 52),
	(11545, 'Mladá žena nastúpi do taxíka a vraví:\r\n”Do pôrodnice, prosím.”\r\nTaxikár poriadne dupne na plyn a žena na to:\r\n”Nemusíte sa ponáhľať, ja tam len pracujem.”              ', 189, 3, 52),
	(11546, 'Ide muž okolo cintorína a vidí ako hrobár vykopáva všetky hroby. Nejde mu to do hlavy, tak ide za ním a pýta sa ho:\r\n”Počuj, hrobár a prečo vykopávaš všetky tie hroby?”\r\nA hrobár mu na to hovorí:\r\n”Ale, hovorili mi, že tu je bomba, tak evakuujem.”              ', 286, 4.13, 52),
	(11547, 'Koktavý majster a jeho učeň išli kuť krompáč.\r\n”Ttty budeš kk kk kkuť a jja ti ti p ppoviem, kkedy dd dd ddosť...” hovorí majster.\r\nPo desiatich minútach kovania spustí majster:\r\n”Dd dd do ddo ddo do kelu, kuj ďalej bude lopata!”              ', 265, 3, 52),
	(11548, 'Zamestnanec príde za riaditeľom a hovorí:\r\n”Pán riaditeľ, musíte mi zvýšiť plat. Musím vám prezradiť, že tri ďalšie firmy majú o mňa záujem.”\r\n”Nehovorte, ktoré sú to?”\r\n”Daňový úrad, telekomunikácie a elektrárne.”              ', 265, 3.7, 52),
	(11549, 'Stretnú sa dvaja burzoví makléri vo fitness centre:\r\n”Čo posiluješ?”\r\n”Dnes britskú libru.”              ', 119, 3.44, 52),
	(11550, 'Šéf sa pýta sekretárky:\r\n”Koľko je hodín, Elenka?”\r\n”Koľko poviete, pán riaditeľ.”              ', 113, 3.56, 52),
	(11551, 'Chlapík je prvý deň v novej práci. Zdvihne telefón, vytočí číslo a zreve:\r\n”Dones mi jednu kávu, ale rýchlo do kelu!”\r\nZ telefónu sa ozve:\r\n”Čo si to dovoľujete? Viete vôbec s kým sa rozprávate?”\r\n”Nie. Neviem.”\r\n”Ja som riaditeľ tejto spoločnosti, vy idiot!”\r\n”A viete vy, s kým sa rozprávate, vy idiot?\r\n”Nie.” odpovedá riaditeľ.\r\n”To je dobre.” povie chlapík a zloží slúchadlo.              ', 447, 4, 52),
	(11552, 'Pacient na psychiatrickom vyšetrení. Doktor mu namaľuje obdĺžnik:\r\n”Čo vám tento obrazec pripomína?”\r\n”To je posteľ. Keď si žena ľahne napríklad sem, tak muž si môže ľahnúť napríklad sem.”\r\nPotom doktor namaľuje krúžok:\r\n”A čo vám pripomína tento obrazec?”\r\n”Posteľ. Keby si žena ľahla takto, muž by si mohol ľahnúť takto.”\r\nĎalej namaľuje doktor trojuholník. Ešte než stihne položiť svoju otázku, pozrie sa na neho pacient podozrievavo:\r\n”Doktor! Veď vy ste sexuálny maniak!”               ', 554, 4.11, 52),
	(11553, 'Miliardár sa sťažuje lekárovi:\r\n”V poslednej dobe sa mi, pán doktor, zhoršuje pamäť.”\r\n”Buďte rád, budete mať aspoň čistejšie svedomie.”              ', 172, 3.7, 52),
	(11554, 'Roztržitý doktor\r\n- Pán doktor, s tým teplomerom ten recept nenapíšete.\r\n- Preboha, v ktorom zadku som si zabudol pero?!              ', 140, 3.89, 52),
	(11555, 'Lekárske konzílium:\r\n“Čo urobíme s pacientom Novákom, budeme ho liečiť, alebo ho necháme žiť?”              ', 122, 3.57, 52),
	(11556, 'Zákazník sa sťažuje majiteľovi obchodu:\r\n- Vaša predavačka ma urazila. Chcem, aby vzala svoje slová späť.\r\n- Veľmi ľutujem, ale my späť nič neberieme. Môžeme vám to však vymeniť za iné.              ', 220, 3.88, 52),
	(11557, 'Odchádza zamestnanec o šiedmej večer z firmy a šéf sa ho pýta:\r\n- Čo je? Berieš si pól dňa dovolenky?\r\n- Nie, odchádzam na obed...              ', 155, 2.8, 52),
	(11558, 'Dežo číta v novinách:\r\n“Hľadá sa muž vo veku asi štyridsať rokov, ktorý v noci na opustených miestach prepadáva ženy a obťažuje ich.”\r\nOtočí sa na manželku a hovorí:\r\n- Eržika, myslíš, že by ma na to miesto vzali?              ', 254, 4.1, 52),
	(11559, 'Robotníci na stavbe stavajú brutálne vysoký komín, už ho majú skoro hotový, keď k nim zrazu pribehne zadýchaný majster a hovorí: \r\n- Chlapi, prúser! Niekto mi otočil stavebný plán, my sme mali studňu kopať!!\n', 226, 4.18, 52),
	(11560, 'Právnika sa pýtali, či by sa chcel stať Svedkom Jehovovým.\r\nOn odmietol, pretože vraj nebol svedkom tej nehody, ale rád by sa toho prípadu ujal na súde.\n', 162, 3.4, 52),
	(11561, 'Právnici sa nemusia obávať hroziacej automatizácie.\r\nNikto vám predsa dnes nebude stavať robota, ktorý by nič nerobil.\n', 127, 4, 52),
	(11562, 'Čo má spoločného právnik a ropucha?\r\nObaja majú veľkú hlavu, ktorá je tvorená z väčšej časti ústami.\n', 116, 2.71, 52),
	(11563, 'Čo sú tri najčastejšie otázky právnika?\r\n1. Koľko máte peňazí?\r\n2. Kde môžete zohnať viac?\r\n3. Máte niečo, čo by sa dalo predať?\n', 146, 4, 52),
	(11564, '- Pán hlavný, to nie je polievka, ale akási voda!\r\n- Nie akási! Prevarená je!              ', 96, 3.67, 52),
	(11565, '- Pán kolega, u nás sa pri práci nepospevuje! \r\n- A kto tu podľa vás pracuje?              ', 96, 3.86, 52),
	(11566, '- Ako to, že nič nerobím, pán majster? - bráni sa podriadený. \r\n- Ja predsa fajčím!              ', 105, 3.8, 52),
	(11567, '- Pán hlavný, vy ste na mňa zabudol?\r\n- Nie, ja som sa na vás vykašlal.              ', 90, 4.07, 52),
	(11568, '- Čím bol tvoj otec?\r\n- Maród.\r\n- Ale čo robil?\r\n- Kašľal.\r\n- Ale veď z toho sa nedá žiť.\r\n- Veď aj zomrel.              ', 132, 4.06, 52),
	(11569, 'Muž vstúpi do právnickej kancelárie a pýta sa, aké sú ceny za právnu radu.\r\n- Päťsto korún za tri otázky, - vraví  advokát. \r\n- Nie je to trochu drahé?\r\n- Áno. A vaša tretia otázka?              ', 213, 3.78, 52),
	(11570, 'Chlapík letí na zájazd malými aerolinkami. Letuška sa ho pýta: "Chceli by ste večeru?"\r\nOn: "Aký máte výber?"\r\nOna: "Áno alebo nie!"              ', 157, 3.43, 52),
	(11571, 'Odchádza zamestnanec o siedmej večer z firmy a šéf sa ho pýta:\r\n- Čo je? Berieš si pol dňa dovolenky?\r\n- Nie, odchádzam na obed...\n', 140, 3.25, 52),
	(11572, 'Na zastávke stojí autobus chystajúci sa na odchod. Beží za ním chlap, je celý spotený a kričí. "Pán vodič, zastavte, inak nestihnem prácu!" Vodič chce odísť, ale cestujúci ho presvedčia, aby počkal. Chlapík dobehne k zadným dverám, naskočí si, dvere sa zatvoria a on si víťazoslávne oddýchne, potom vyberie odznak a povie: \r\n"Revízia cestovných lístkov."              ', 399, 3.74, 52),
	(11573, '"Pán hlavný, tie kurence tu robíte fantasticky. Ako ich pripravujete?"\r\n"Pripravujeme? Proste im povieme, že ich zabijeme a upečieme."              ', 153, 3.57, 52),
	(11574, 'Hladáme telepatov, ozvite sa - viete kam.              ', 56, 3.75, 52),
	(11575, 'Postáva lupič nenápadne pred domom. Konečne sa zvnútra objaví jeho komplic: \r\n- Tak, čo máš? \r\n- Rýchlo preč, ten chlap, čo tam býva, je právnik. \r\n- A doprčíc... o čo všetko si prišiel?              ', 219, 4, 52),
	(11576, 'Sú traja v kancelárii a iba jeden pracuje. Čo je to? \r\nDvaja úradníci a jeden ventilátor.              ', 109, 3.5, 52),
	(11577, 'V utorok dopoludnia odchádza jeden z pracovníkov preč a kolega na neho volá:  \r\n„Kam ideš, Karol?" \r\n„Ále, chcem sa najesť, než zase zaspím."              ', 168, 3.67, 52),
	(11578, 'Príde občan na úrad práce a hovorí:\r\n- Chcel by som prácu, ktorá dobre vynáša.\r\n- Výborne. Máme pre vás miesto riaditeľa so šesdesiattisícovým mesačným platom a služobné auto k tomu.\r\n- Robíte si zo mňa srandu?\r\n- Vy ste s tým začali...              ', 274, 3.25, 52),
	(11579, '”Novák, to je už piatykrát, čo tento týždeň meškáte! Viete, čo to znamená?”\r\n”Žeby už bol piatok?”              ', 133, 3.5, 52),
	(11580, 'Beží chlap za rozbehnutým autobusom. Vidí ho starček a vraví mu:\r\n- Pane, ten už asi nestihnete, počkajte si na ďalší.\r\n- Ja nemôžem, ja som vodič!              ', 175, 3.6, 52),
	(11581, 'Poznáme dva druhy právnikov: tých, ktorí poznajú zákony a tých, ktorí poznajú sudcu.              ', 107, 4, 52),
	(11582, '"Prečo ťa vyhodili z práce?"\r\n"Kvôli kašľu."\r\n"Ako to? Za to, že si chorý, predsa nemôžeš."\r\n"No áno, ale ja som kašlal na prácu."\n', 145, 4, 52),
	(11583, 'Prečo je v Kalifornii toľko právnikov a v New Jersey toľko skladov toxických odpadov?\r\nNew Jersey si vyberalo prvé.\n', 122, 4, 52),
	(11584, 'Právnik mal pri súde zložitý obchodný prípad. Jeho klient bol zrovna mimo mesto, keď sa súd zišiel k vyneseniu rozsudku, ktorý znel v prospech tohto klienta. \r\nPrávnik mu preto posiela telegram:\r\n"Spravodlivosť triumfovala."\r\nNačo klient okamžite telegramuje späť:\r\n"Ihneď podajte odvolanie!"\n', 310, 3.83, 52),
	(11585, 'Porota je skupina ľudí vybraných, aby rozhodli, kto si najal lepšieho právnika.\n', 85, 4.18, 52),
	(11586, 'Ako bol vynájdený medený drôt?\r\nDvaja právnici sa hádali o jednu penny.\n', 78, 4.22, 52),
	(11587, 'Dvaja partneri v právnickej firme boli na obede, keď sa jeden zdvihne:\r\n"Musím naspäť do kancelárie, zabudol som zamknúť sejf!"\r\n"Čoho sa bojíš? Sme obaja tu!"\n', 171, 4.21, 52),
	(11588, 'Chlap si najal obhajcu, keď bol obvinený, že spreneveril desiatky miliónov zo svojej firmy. Chcel sa vyhnúť vezeniu. Právnik ho ubezpečoval:\r\n"Nebojte sa, s takým balíkom peňazí nikdy nepôjdete do vezenia."\r\nA mal pravdu. Keď ten chlapík išiel sedieť, nemal už ani halier.\n', 291, 4.2, 52),
	(11589, 'Čo získate, keď skrížite právnika a knihovníka?\r\nVšetky informácie, ktoré by ste mohli potrebovať. Ale neporozumiete z toho ani slovo.\n', 146, 3.78, 52),
	(11590, 'Deň po vynesení rozsudku ide obhajca za sudcom a požaduje znovuotvorenie prípadu:\r\n"Mám nové fakty, ktoré výrazne ovplyvnia obhajobu môjho klienta." "Prosím vás, aké nové svedectvá môžete mať?"\r\n"Môj klient, ako som práve zistil, má ešte 200,000."\n', 269, 3.75, 52),
	(11591, 'Skúsený právnik prehrá spor s obžalovaným z lúpeže. Jeho klient sa k nemu otočí a hovorí:\r\n"A čo teraz?"\r\n"Ty, synu, pôjdeš teraz do vezenia a ja idem na obed."\n', 175, 4.14, 52),
	(11592, '"Prečo ste prišiel o dve hodiny neskôr do práce?"\r\n"Včera ste mi povedal, aby som si noviny prečítal doma..."\n', 117, 3.5, 52),
	(11593, 'Na podnikovej schôdzi sa riaditeľ pýta zamestnancov:\r\n"Povedzte mi, čo budeme mať, keď budeme všetci pracovať na 125 percent?"\r\nZ davu sa ozve:\r\n"Hovno a štvrť!"\n', 172, 4.13, 52),
	(11594, 'Príde zákazník k holičovi a hovorí:\r\n"Jednu kotletu nechať do pol tváre, druhú celú vyholiť. Hore to ostrihajte, aby to trčalo von a nedalo sa to česať.\r\n No a vzadu mi vyhoľte pár miest až na kožu."\r\n"Pane, takto vás ale ostrihať nemôžem!"\r\n"Ako to, že nie? Minule ste ma tak ostrihal!"\n', 310, 3.83, 52),
	(11595, 'Chlap pokladal linoleum a po práci si chcel zapáliť. Začal hľadať cigarety a vtom si všimol na podlahe vypuklinu. \r\n"Predsa to už nebudem prerábať," vraví si.\r\nZačal na cigarety skákať, až bola podlaha rovná. Zrazu príde pani domu a vraví:\r\n"V kuchyni ste si nechal cigarety...a nevidel ste tu niekde nášho škrečka?"\n', 339, 3.91, 52),
	(11596, 'Čo urobí šéf, keď sa cíti osamelo? \r\nZvolá poradu...\n', 60, 3.92, 52),
	(11597, 'Šéf sa pýta zamestnanca:\r\n"V čom spočíva neúspech našej firmy? V nevedomosti alebo v nezáujme?" \r\nZamestnanec:\r\n"Neviem a ani ma to nezaujíma!"              ', 167, 3.92, 52),
	(11598, 'Pýta sa fotograf kolegu:\r\n- Tak ako dopadla tvoja výstava v očiach kritikov?\r\n- Ále, nemôžu sa dohodnúť. Jedným je ľúto filmu, druhým papieru.              ', 168, 3.89, 52),
	(11599, 'Rozčuľuje sa muž v práci:\r\n- Pred chvíľou som tu mal salámu a už je v prdeli. \r\nKolega na to:\r\n- Teda, ty máš ale trávenie! \n', 136, 4.01, 52),
	(11600, 'Hovorí úradník riaditeľovej sekretárke:\r\n- Prekvapujete ma, Majka. Stále ste tak krásne a moderne oblečená. Ako to dokážete pri svojom skromnom príjme?\r\n- No, viete, kolega... - rozmýšľa Majka - Ako vám to len vysvetliť...?\r\n... Viete čo? Vám to i tak na nič nebude!              ', 300, 4.18, 52),
	(11601, 'Naštvaný hosť v reštaurácii hlasno volá na čašníka:\r\n- Pán hlavný, máte zapchaté uši?\r\nHlavný na to:\r\n- Moment, opýtam sa v kuchyni.\n', 149, 3.75, 52),
	(11602, 'Na francúzskej hranici vkročí do kupé colník a hlasno sa spytuje:\r\n- Koňak, tabak, narkotiká... \r\n- Kávu, prosím. - odpovedá cestujúci. \n', 148, 3.8, 52),
	(11603, 'Šéf sa pýta svojho podriadeného:\r\n- Veríte v posmrtný život?\r\n- Nie. Prečo sa pýtate?\r\n- Včera, keď ste odišli na pohreb vášho starého otca, prišiel vás sem hľadať.\n', 184, 3.72, 52),
	(11604, 'Cestujú spolu v aute automechanik, chirurg a programátor. Auto sa zrazu pokazí, každý z nich navhuje riešenie. Automechanik hovorí:\r\n- Vystúpime a pozrieme sa na motor, čo sa s tým dá spraviť.\r\nChirurg hovorí:\r\n- Vystúpime, vytiahneme motor, všetko rozoberieme a uvidíme.\r\nProgramátor vraví:\r\n- Skúsme vystúpiť a nastúpiť ...\n', 349, 4.06, 52),
	(11605, 'Príde maník v montérkach na intenzívku a hovorí:\r\n- Chlapi, na tri zadržte dych, mením poistky!              ', 116, 4.09, 52),
	(11606, 'Hovorí ožratý ekonóm:\r\n- Ešte deci investícií a je zo mňa nehnuteľnosť...              ', 97, 3.68, 52),
	(11607, 'Literárny agent hovorí klientovi:\r\n- Dobrá správa je, že Rowanovi a Martinovi sa váš rukopis ohromne páčil. Doslova ho žrali. Zlá správa je, že Rowan a Martin sú moji dvaja francúzski pudlíci.              ', 222, 4.2, 52),
	(11608, 'Veža volá lietadlo: \r\n- Je tam kapitán?\r\n- Hik, je vzadu, opitý a, hik, súloží s letuškou, hik.\r\n- A kde je prvý pilot?\r\n- Na záchode, hik, opitý, vracia...\r\nDispečér s hrôzou v hlase:\r\n- A vy ste vlastne kto?\r\n- No predsa, hik, au... auto, hik, autopilot, hik,...              ', 292, 4.08, 52),
	(11609, 'Rozprávajú sa dve sekretárky:\r\n- Aký je tvoj šéf?\r\n- Senzi chlap. Trochu úradujeme, trochu sa milujeme a takto to ide celý deň.\r\n- A tvoj?\r\n- Aj môj je vynikajúci, ale my sme tú zbytočnú byrokraciu už dávno odbúrali.              ', 247, 3.14, 52),
	(11610, 'Žena futbalového rozhodcu komentuje:\r\n"Nechápem, prečo musíš chodiť každú nedeľu pískať na futbal! Tých pár po papuli môžeš dostať aj doma!"              ', 172, 3.8, 52),
	(11611, 'Na súde\r\n"Vydatá?" opýtal sa sudca svedkyne. Svedkyňa si povzdychla. "Slobodná." nadiktoval sudca zapisovateľke.\r\n"Ženatý?" opýtal sa sudca druhého svedka. Svedok si povzdychol. "Ženatý." nadiktoval sudca.              ', 231, 3.57, 52),
	(11612, 'Dve bývalé spolužiačky sa stretnú v kaviarni a rozprávajú sa:\r\n- Čo teraz robíš? - pýta sa jedna.\r\n- Som sekretárka.\r\n- A čo to obnáša?\r\n- No, ráno uvarím riaditeľovi kávu, napíšem list alebo niečo, čo mi nadiktuje, potom sa pohráme, ideme na obed, niečo mu napíšem, pohráme sa a je večera, a tak ďalej... A čo robíš ty?\r\n- Ja robím tiež šľapku, akurát toho písania nemám toľko.              ', 433, 4, 52),
	(11613, 'Pýta sa riaditeľ sekretárky:\r\n- Ivetka, aký máme dnes deň?\r\nIvetka sa začervená a vraví:\r\n- Neplodný, pán riaditeľ...              ', 143, 4.22, 52),
	(11614, 'Šéf prijíma sekretárku a hovorí jej:\r\n- Na skúškach ste obstáli dobre, hodnotenie a odporúčania máte vynikajúce, ale rád by som vedel, či viete dobre rátať.\r\n- Samozrejme, perfektne.\r\n- Tak choďte do vedľajšej miestnosti, vyzlečte sa a rátajte s tým, že o chvíľu som pri vás...              ', 317, 4, 52),
	(11615, 'Režisér hovorí hercovi: \r\n"Teraz budete musieť plávať pred žralokom." Herec zhrozený pozrie na režiséra a povie: \r\n"Pán režisér, ale ja neviem plávať!" \r\nRežisér bez štipky zľutovania povie: "Aj tak je to záverečná scéna."              ', 259, 3.63, 52),
	(11616, 'Psychiater hovorí kolegovi:\r\n"Mám výborného pacienta. Trpí rozdvojením osobnosti a platia obaja."              ', 117, 4.06, 52),
	(11617, 'Poradňa\r\nPacient prosí lekára:\r\n"Pán doktor, nevydržím ďalej tak strašne trpieť! Radšej ma zabite!"\r\n"Neraďte mi, dobre?!"              ', 147, 3.57, 52),
	(11618, '"Čítal som hodnotenie tých účtovných programov a ten <censored> má všetko, akurát nemá to hot line. Čo je to prosím vás to hot line?\r\n"To je práve to, že nám teraz voláte."              ', 203, 2.73, 52),
	(11619, 'Do ruského závodu príde kontrola a kontrolór sa pýta robotníka:\r\n"Nuž, tovarišč, keď vypiješ pol deci vodky môžeš pracovať?"\r\nA robotník na to:\r\n"No, čo by som nemohol, môžem."\r\n"A keď vypiješ dva deci vodky, môžeš pracovať?"\r\n"No môžem."\r\n"A keď vypiješ pol litra?"\r\n"Môžem."\r\n"A keď vypiješ celú fľašu?"\r\n"A čo nepracujem?"	              ', 377, 3.37, 52),
	(11620, 'Príde opravár do veľkej budovy, kde sa pokazil záchod a pýta sa recepčnej:\r\n”Kde je ten hajzel?”\r\n”Pán riaditeľ je práve na poschodí.”\r\n”Vy ste ma zle pochopili, ja myslím tie dve nuly.”\r\n”Ach áno, námestkovia sú na porade.”\r\n”Ale nie, ja myslím to, kde sa robí hovno.”\r\n”Učtáreň je pod nami.”              ', 350, 4.08, 52),
	(11621, 'Vedúci vyčíta zamestnancovi:\r\n”Ako to vlastne je? Ráno volala vaša manželka, že ležíte doma so zápalom pľúc a vy ste tu!”\r\n”No, ... ona sa pomýlila, mala volať až zajtra.”              ', 208, 3.86, 52),
	(11622, 'V ordinácii:\r\n”Slečna, už ste vyzlečená?”\r\n”Áno, pán doktor. A vy?”              ', 96, 4.2, 52),
	(11623, 'Novinárska anketa ”Čo si myslíte o nadväzovaní milostných vzťahov na pracovisku? Pomáha to,škodí?”\r\n”Keď ja neviem,” škriabe sa opýtaný za uchom, ”keď u nás sú všetky ženy také chladné.”\r\n”A kde pracujete?”\r\n”V márnici.”	              ', 277, 3.57, 52),
	(11624, 'Hrobárova žena vyčíta mužovi:\r\n”To si nemohol prísť skôr?”\r\n”Nie, naozaj. Dnes sme pochovávali jedného slávneho televízneho herca a mal taký aplauz, že sme ho museli šesťkrát vyhrabávať.”              ', 228, 3.44, 52),
	(11625, 'Dve mladé, atraktívne a čerstvo graduované právničky Sally a Edith súťažili o prestížne miesto. V rámci prijímacieho pohovoru sa každej z nich spýtali, prečo chce nastúpiť práve tam. Edith odpovedala, že chce pracovať pre firmu s dobrou reputáciou, ktorej ide o pravdu a spravodlivosť. Sally jednoducho otvorila kabelku, vybrala z nej dosť tenkú peňaženku a položila ju na stôl pred seniora firmy.\r\n- Chcela by som, aby stlstla, ako najrýchlejšie to pôjde, - povedala.\r\nSally bola prijatá.              ', 536, 3.25, 52),
	(11626, 'Lekár stretol cez prázdniny na Riviére starého priateľa, právnika, a hneď sa ho pýtal, kde na takú dovolenku vzal. Právnik odpovedal:\r\n- Pamätáš sa na ten mizerný dom, ktorý som kúpil? Tak ten vyhorel a ja si užívam peniaze vyplatené poisťovňou. A čo ty?\r\nLekár vysvetľuje:\r\n- Pamätáš sa na ten mizerný dom, čo som mal pri Mississippi? Tak ten vzala pri záplave voda a ja si užívam peniaze od poisťovne.\r\nPrávnik sa zatváril úplne zmätene:\r\n- No, - povie, - ale ako si urobil tú záplavu?              ', 540, 4, 52),
	(11627, '- Viete, aký je rozdiel medzi inžinierom, fyzikom a matematikom?\r\n- ???\r\n- Predstavte si situáciu, keď spíte v hoteli a vo vašej izbe začne horieť. Čo urobí inžinier? Prebudí sa, zistí že horí, vezme vedro, napustí ho vodou, uhasí požiar a ide spať. Fyzik: Prebudí sa, zistí, že horí, vypočíta si, koľko bude potrebovať vody na uhasenie. Zistí, že 4.3 litra, napustí do vedra 4.3 litra vody, zaleje oheň a ide spať. No a matematik sa prebudí, zistí, že horí, pôjde ku kohútiku, pustí vodu, zistí, že riešenie existuje, zavrie vodu a ide spať.              ', 599, 3.78, 52),
	(11628, 'Traja starší páni boli na vedeckej konferencii ubytovaní na sedemdesiatom poschodí mrakodrapu. Po celom dni strávenom na prednáškach sympózia ich zdrvila správa, že v hoteli nefunguje výťah. Prvý hovorí:\r\n- Čo sa dá robiť, páni. Musíme ísť pešo a aby nám to pekne ubehlo, navrhujem, aby sme našu pozornosť cestou upriamili na niečo príjemné. Tak napríklad, ja by som mohol začať rozprávať vtipy, ty začneš na dvadsiatom piatom poschodí spievať a ty začneš na päťdesiatom poschodí rozprávať smutné príbehy.\r\nTak teda vyrazili a prvý rozprával vtipy. Cesta príjemne ubiehala a keď druhý na päťdesiatom poschodí dospieval, tretí sa nadýchol a vraví:\r\n- Začnem svojím najsmutnejším príbehom. Kľúče od izby som nechal v aute...\n', 789, 4, 52),
	(11629, 'Príde nový šéf do svojej kancelárie, kde preberá miesto po minulom riaditeľovi. Ten ho poúča, čo a ako, a keď prídu na tému sekretárky, ten starý mu vraví:\r\n“Keď si budeš chcieť..., veď vieš, musíš sekretárke povedať, že chceš napísať list do Istanbulu.” Nový riaditeľ sa síce čuduje, ale poslúchne ho a na druhý deň hovorí sekretárke:\r\n“Evička, chcel by som napísať list do Istanbulu!”\r\n“Pán riaditeľ, dnes akurát nemôžem, mám červenú pásku v stroji.”\r\nRiaditeľ sa diví, ale nepovie nič. Za týždeň príde sekretárka:\r\n“Už som si vymenila tú pásku, môžeme to napísať.”\r\n“Nie je treba, zvládol som to ručne...”\n', 696, 4.25, 52),
	(11630, 'Robotník padá z lešenia a spolupracovníci naňho zhora kričia:\r\n- „Fero, pridaj, letí za tebou tehla!“', 112, 3.65, 52),
	(11631, 'Vyčíta hrobárova žena mužovi, že sa vrátil neskoro domov:\r\n-"To si nemohol prísť skôr?"\r\n-"Nie, naozaj. Dnes sme pochovávali jedného slávneho televízneho herca a mal taký aplauz, že sme ho museli šesť krát vyhrabávať."', 239, 3.58, 52),
	(11632, 'Hádajú sa drevorubač, záhradník a elektrikár, že ktoré remeslo bolo skôr.\r\n- Drevorubač: My sme stavali Noemovu archu!\r\n- Záhradník: My sme vysádzali Rajskú záhradu!\r\n- Elektrikár: Keď Boh povedal: SVETLO!, my sme už mali ponaťahované káble!!! ', 265, 3.59, 52),
	(11633, 'Modlitba :\r\nPane Bože, daj mi vedomosti vedúce k poznaniu ľudí, aby som dokázal pochopiť svojho šéfa, daj mi lásku, aby som mu dokázal odpustiť.\r\n\n...lebo Bože, až Ťa požiadam o silu a Ty mi ju dáš, takú mu pridrbem, že sa v živote nepozbiera, debil jeden...', 278, 3.59, 52),
	(11634, 'Čašník donáša polievku zákazníkovi, a má strčený palec v polievke. Na palci má vred. Zákazník sa ho pýta: "Prečo máte v mojej polievke palec z vredom?"\r\nČašník: "Doktor hovoril, že si ho mám udržiavať v teple."\r\nZákazník: "Tak si ho strčte do zadku!"\r\nČašník: "Tam som ho mal pred chvíľou."', 321, 3.71, 52),
	(11635, 'Rozprávajú sa tri sekretárky\r\n- Včera som našla šéfovi v zásuvke kondóm.\r\n- Ja som ho prepichla.\r\n...a tretia omdlie...', 128, 3.61, 52),
	(11636, 'Starý poštár odchádzal do dôchodku. Už roky roznášal po svojom rajóne poštu a tak ho všetci poznali. Prišiel jeho posledný pracovný deň. Ľudia sa s ním lúčili. Jedna rodina mu dala kľúčenku, druhá podarovala na pamiatku pero. Odrazu zazvonil pri jedných dverách, otvorila prekrásna sexi blondínka, vtiahla ho za ruku dovnútra, vyzliekla a strávili dve hodiny milovaním v tých najnemožnejších akrobatických polohách. Potom si dali sprchu, senzačné raňajky (vajíčko, slaninka, džús a všelijaké dobrôtky) a nakoniec mu blondínka dala 5 dolárov. Ohromený poštár sa pýta:\r\n- Ako je to možné, že sa ku mne takto krásne správate, čo sa stalo?\r\nA blondínka odpovedá:\r\n- Včera som povedala manželovi, že nás poštár odchádza do dôchodku, že by bolo dobré niečo mu dať na pamiatku. A manžel mi odpovedal "Ale, jebať ho, daj mu 5 dolárov. No a raňajky bol môj nápad.', 932, 4.14, 52),
	(11637, 'Chlapík je prvý deň v novej práci. Zdvihne telefón, vytočí číslo a zreve:\r\n- Dones mi jednu kávu, ale rýchlo do riti!\r\nZ telefónu sa ozve:\r\n- Čo si to dovoľujete? Viete vôbec s kým sa rozprávate?\r\n- Nie. Neviem.\r\n- Ja som riaditeľ tejto spoločnosti, vy idiot!\r\n- A viete vy s kým sa rozprávate, vy idiot?\r\n- Nie. - odpovedá riaditeľ.\r\n- To je dobre. - povie chlapík a zloží slúchadlo.', 411, 4.02, 52),
	(11638, 'Príde nový šéf do dielne v podniku a vidí chlapíka, ktorý je opretý o stenu a hľadí do prázdna. \r\nŠéf sa pýta: Koľko zarábaš za týždeň?\r\nChlapík sa zrazu preberie a hovorí: Tak asi 3 tisíc.\r\nŠéf otvorí peňaženku a dá mu 6 tisíc. Tu máš, a viac sa mi tu neukazuj!! Chlapík s radosťou príjme peniaze a ihneď zmizne. Šéf sa pýta ostatných, že na akú prácu tu bol ten človek prijatý? Zamestnanec odpovie: No, na žiadnu, bol to  roznášač pizze...\r\n', 492, 4.14, 52),
	(11639, 'Šéf s ťažkým povzdychom hovorí svojmu podriadenému:\r\nČloveče, to je strašné! Vy všetko robíte pomaly. Pomaly pracujete, pomaly chodíte, pomaly jete... Robíte vlastne niečo  rýchlo?\r\nON: Ááale ánoo, rýchlo sa unavím.', 237, 3.67, 52),
	(11640, 'Potkají se tři sekretářky.\r\nTa první povídá: Já našla u šéfa v kanceláři kondom.\r\nTa druhá: Já ho propíchla.\r\nA ta třetí omdlela.', 147, 4.19, 52),
	(11641, 'Dvaja policajti našli mŕtve telo ženy. Idú za kapitánom polície a jeden z nich hovorí:\r\n"Pán kapitán našli sme mŕtvu ženu".\r\nA kapitán na to: \r\n"Dúfam,že ste ju ignorovali".\r\n"Jasné, ja raz a on dvakrát" ', 221, 3.25, 52),
	(11642, 'U holiča sedí na kresle malé dievčatko a spadne mu na zem žuvačka.\r\nZodvihne ju a šup s ňou do úst. „A nemáš ju chlpatú?“ - pýta sa holič.\r\nDievčatko sa naňho nevinne pozrie a vraví: „Nie, ja mám ešte len 6 rokov.“\r\n', 243, 3.76, 52),
	(11643, 'Práca ma naozaj fascinuje - môžem na ňu pozerať aj celý deň.', 67, 4.08, 52),
	(11644, 'Lyžiar v plnej výbave letí dolu svahom.\r\nTrafí kameň, spadne a brutálne sa rozbije.\r\nNohavice roztrhané, palice ohnuté, lyže na triesky, tvár krvavá.\r\nVstane, otrasie sa, pozrie sa hore na svah a povie:\r\n- Aj tak lepšie, ako sedieť v tej robote!!! ', 261, 3.82, 52),
	(11645, '- Koľkí tu pracujete na stavbe?\r\n- S majstrom piati.\r\n- Teda bez majstra štyria...\r\n- Nie! Bez majstra nikto.', 112, 3.79, 52),
	(11646, 'Letuška sa zastaví pri cestujúcom, zachichoce sa a hovorí mu: " Pane, poviem vám niečo, na čom sa budete smiať celou cestou do Paríža... Trčí vám konček penisu... \r\n" Pán sa na ňu pozrie, usmeje sa a hovorí jej: "A ja vám poviem niečo, na čom sa nebudete smiať iba cestou do Paríža, ale aj cestou späť. To nie je konček, to je celý."', 360, 4.28, 52),
	(11647, '- A čo sa stalo pán riaditeľ? Sám si píšete správu? Kde máte sekretárku?\r\n- Minulý mesiac sa vydala.\r\n- Nehovorte. A za koho?\r\n- Za mňa.', 147, 3.88, 52),
	(11648, 'Vo výťahu stojí upratovačka.\r\nNa 1. poschodí k nej pristúpi mladá, zjavne bohatá dáma, strekne na seba voňavku a arogantne poznamená:\r\n,,Chanel No. 5. Londýn, 50 eur za mililiter."\r\nNa 2. poschodí nastúpi mladá herečka, tiež zjavne bohatá, strekne na seba voňavku, pozrie sa na obidve a povie:\r\n,,Gucci Romance. Peking, 100 eur za mililiter."\r\nNa 3. poschodí upratovačka vystúpi, nahlas si uľaví a povie:\r\n,,Lidl - brokolica. Ružomberok, 50 centov za kus."', 481, 4.16, 52),
	(11649, 'Príde zamestnanec za svojim šéfom a pýta sa ho: "Pán riaditeľ, mohli by ste mi dať voľno? Manželka chce, aby som jej pomohol pri upratovaní."\r\nRiaditeľ: "Nie."\r\nA zamestnanec mu hovorí: "Ďakujem pán riaditeľ, ja som vedel, že sa na vás dá spoľahnúť."', 271, 4.29, 52),
	(11650, 'Chlapi pracujú na stavbe. Fero sa pošmykne a zletí z tretieho poschodia. Pád našťastie prežije, avšak príde o jedno ucho. Na druhý deň, keď ho kolega zbadá mu hovorí: \r\nFero, tebe sa zlepšil zrak?! \r\nPrečo si to myslíš? \r\nŠak už nenosíš okuliare! ', 269, 3.52, 52),
	(11651, 'Rus sa pýta slováka:\r\n- Odkuda ty idiot?\r\n- Ja idiot zo Slovenska.', 68, 3.16, 53),
	(11652, 'Ivan s Voloďom opravujú žumpu. Ivan vlezie dovnútra a hovorí Voloďovi: \r\n- Podaj mi kľúč. \r\nVoloďa mu podá, Ivan sa nadýchne a ponorí medzi obsah žumpy, po chvíli sa vynorí a pýta si iný kľúč, proces sa opakuje, pýta si iné nástroje. Keď to dokončia, vylezie Ivan zo žumpy, zapáli si a hovorí Voloďovi: \r\n- Vidíš, vidíš, Voloďa, keby si lepšie študoval, nemusel by si len kľúče podávať!', 428, 3.32, 53),
	(11653, 'Sovietsky lyžiar dôjde do cieľa medzinárodných pretekov v rekornom čase na jednej lyži.\r\nReportéri sa ho pýtajú:\r\n- Prečo máte iba jednu lyžu?\r\nOn na to :\r\n- Pretože sovietske lyže vo svete nemajú páru.', 219, 3.16, 53),
	(11654, 'Koľko rusov potrebujeme na výmenu žiarovky?\r\n100.\r\n1 vymieňa žiarovku a 99 obkľúči budovu.', 98, 3.1, 53),
	(11655, 'Sovietsky raketoplán havaroval. V troskách boli nájdený všetci členovia posádky: lodný tesár, kapitán a nástenkár.', 126, 2.97, 53),
	(11656, 'Aký nový druh WC vymysleli na Sibíri ?\r\nDva veľké koly. O jeden sa človek prichytí a druhým odháňa vlkov.', 115, 3.37, 53),
	(11657, 'Dotazník pre sovietskeho vojeka:\r\n1. otázka: Kto je váš najväčší vojenský idol?\r\n2. otázka: Prečo práve Lenin?', 122, 3.36, 53),
	(11658, 'Sovietsky zväz,1985. Príde Masa do obchodu a pýta si mäso.\r\n- Mäso nemáme, ale máme ryby.\r\nTak vezme rybu a kedže nemá tašku, tak jej ju zabalia do novín. Ide po meste a stretne Sašu. Saša sa jej pýta:\r\n- Máša, što nové v gazzete?\r\n- Ryba.', 257, 3.06, 53),
	(11659, 'Sovietsky zväz, rok 1985. Príde zákazník do mäsiarstva:\r\n- Narežte mi prosím 100 gramov šunky.\r\n- Doneste, narežeme... ', 128, 3.25, 53),
	(11660, 'Rusko. Ivan si kúpi auto, príjde domov a zaparkuje. Ráno pozerá z okna - auto nikde. Ide to ohlásiť na milíciu. Milicionár ho vypočuje a hovorí: \r\n- Tak sa pozrite tu nad dvere, čo vidíte?\r\n- No obraz V.I. Lenina.\r\n- No a čo je to na tom obraze? Pozrite sa poriadne!\r\n- V.I.Lenin, obklopený svojimi najlepšími priateľmi.\r\n- No a čo vidíte ešte? Čo drží Lenin v ruke?\r\n- Čiapku.\r\n- No, tak to vidíte. V.I.Lenin, obklopený svojimi najlepšími priateľmi a drží si svojou čiapku v ruke. A vy si necháte stáť auto na ulici!', 552, 3.1, 53),
	(11661, 'V jeden októbrový podvečer zaklopú dvaja ruský mládenci na okno domu, v ktorom býva 90-ročná babka a pýtajú sa jej:\r\n- Babuška, nužno vám derevo?\r\n- Net, ne nuýno.\r\nBabka ráno vstala a na dvore ani triesky.', 222, 3.15, 53),
	(11662, 'Na Sibíri:\r\nNa brehu mora sedí chlapík a chytá ryby. Zrazu sa z hlbín mora vynorí americká ponorka, otvorí sa poklop a vytrčí sa nejaký vojak. Chvíľu sa s ďalekohľadom obzerá dookola, potom dolu zakričí: \r\n- Smer severo-severovýchod!\r\nZalezie, zabuchne poklop a ponorka mizne v mori. Chlapík chvíľu pozerá, ale ďalej sa venuje rybárčeniu. Pár minút nato sa z mora vynorí ruská ponorka, vytrčí sa vojačisko, a keď zbadal rybára, kričí naňho: \r\n- Hej ty tam! Nebola tu náhodou pred chvíľou americká ponorka?\r\nRybár kričí, že hej. Vojak: \r\n- A ktorým smerom odplávali?\r\n- Smer severo-severovýchod!\r\n- Ty čurák! Nemachruj a ukáž rukou.', 684, 3.65, 53),
	(11663, 'Ako sa po rusky povie pes čau-čau?\r\nSabaka zdrastvuj-zdrastvuj.', 65, 3.22, 53),
	(11664, 'Rozhovor v moskovskom rádiu:\r\n- Skažite Nataša Ivanovna! Kak vy, uspešnaja profesorka, stalis prostjitutkou?\r\n- Hmm, sama neznaju. Prosto ščastie.', 152, 3.26, 53),
	(11665, 'V Sovietskom zväze nikto nepotreboval postele. \r\nPolovica národa na niečo stála a ostatní sedeli.', 102, 3.17, 53),
	(11666, 'Pošlite ďalšie jedlo STOP Lajku som už zjedol STOP Gagarin STOP ', 68, 3.45, 53),
	(11667, 'Ďaleko, východne od Moskvy, na Sibíri, ruský drevorubači rúbu drevo. Ivan hovorí: \r\n- Voloďa, počul som, že v Los Angeles si drevorubač za týždeň zarobí na auto.\r\n- Ivan a kde je to Los Angeles?\r\n- Tak 8000 kilometrov východné odtiaľto.\r\n- A prosím ťa, načo je komu v takej diere auto?', 306, 3.12, 53),
	(11668, 'Za oných čias si prezidenti Sovietskeho zväzu a USA vymenili sekretárky na znak vzájomnej dôvery. Tak sa aj stalo. Po piatich dňoch volá americký prezident svojej sekretárke:\r\n- Ako sa tam darí?\r\n- Všetko OK, dokážem sa o pridelenú robotu postarať.\r\n- Takže všetko v pohode?\r\n- Áno, ibaže tu v Rusku nie je v móde nosiť minisukne, tak mi každý deň prišijú 5cm k sukni.\r\n- To sa dá vydržať. Dovi.\r\nAj ruský prezident volá svojej sekretárke:\r\n- Ako sa tam darí?\r\n- Všetko OK, dokážem sa o pridelenú robotu postarať.\r\n- Takže všetko v pohode?\r\n- Áno, ibaže tu v amerike nie je v móde nosiť dlhé sukne, tak mi každý deň odstrihnú 5cm zo sukne.\r\n- To sa dá vydržať.\r\n- Áno, problém je však v tom, že o dva dni mi bude vidno vtáka a hlaveň guľometu.', 803, 3.63, 53),
	(11669, 'Estónec stojí pri železničnej trati. Po chvíli ide okolo ďalší Estónec na drezine. Celý udýchaný tlačí páku dreziny hore a dolu. Prvý Estónec sa pýta:\r\n- Ďaleko je do Talinu?\r\n– Nie je to ďaleko.\r\nPrvý Estonec si naskočí na drezinu a chytí sa páky. Hore, dolu, hore, dolu. Po dvoch hodinách mlčanlivého tlačenia sa spýta znovu:\r\n- Ďaleko je do Talinu?\r\n– No teraz už je.', 406, 3.58, 53),
	(11670, 'Do luxusnej reštaurácie v Rusku prídu hostia. Príde čašník a hostia objednávajú:\r\n- Ja by som si dal hovädzí steak.\r\n- Ja by som si dal teľaciu kotletu.\r\n- Ja si prosím kurací špíz.\r\nČašník sa nakloní do kuchyne a kričí:\r\n- Trikrát mäso.', 261, 3.31, 53),
	(11671, 'Tri štáty (Amerika, Slovensko a Rusko) chceli patentovať novú škrabku na zemiaky. Preto sa dohodli na komisii, ktorá rozhodne o tom, ktorá škrabka je najlepšia. Komisia priletela do Ameriky a pozerá: Škrabka ako stôl, nasypali do nej vedro zemiakov a na druhej strane - puk, puk, puk vyletovali očistené zemiačky. Presunuli sa na Slovensko. Tam bola vyrobená škrabka ako dva stoly. Vysypali do nej vrece zemiakov a na druhej strane - puk, puk, puk vyletovali ešte krajšie zemiačky. No dobre. Presunuli sa do Ruska.  Prišli k veľkému hangáru, nad ním boli pripevnené koľajnice, na ktorých nasunuli vagón nad hangár. Zrazu sa vagón otvorí a do hangára začalo padať strašne množstvo zemiakov. Keď sa to všetko vysypalo, komisia pozerá odkiaľ začnú vypadávať zemiaky. Odrazu z takých malých dverí na hangáre vybehne muž so zásterou a škrabkou v ruke a kričí: \r\n- Ja sa na to môžem vykašlať, veď tam všetkých zasypalo!', 974, 3.49, 53),
	(11672, 'Píše sa rok 1985. Dvaja chlapci idú po Červenom námestí a zrazu sa pred nimi otvorí kanál z ktorého vystrčí hlavu starý vysušený dedko a pýta sa: \r\n"Chlapci, už sa skončila vojna?" \r\nChlapci si z neho vystrelia: \r\n"Nie,ešte nie." \r\nDedo si smutne vzdychne: \r\n"Do prdele aj s tým Napoleonom." a zalezie späť.', 328, 3.7, 53),
	(11673, 'V sovietskom zväze postavili obrovskú budovu, ktorá mala mať mimoriadny význam.\r\nTá im však spadla. Začali teda vyšetrovať, kto je vinník.\r\n"Tehly, vy ste na vine!"\r\n"My? Nie. My sme perfektne vypálené z tej najlepšej hliny."\r\n"Štrk, ty si na vine!"\r\n"Kdeže, ja som najkvalitnejší štrk z najlepších riek a preosiaty na správnu hrúbku."\r\n"Cement, ty si na vine!"\r\n"Ojojoj, to ste na omyle, ja som tam vôbec nebol!"', 437, 3.56, 53),
	(11674, 'V ruskej reštaurácii si hostia vyberajú:\r\n- Ja si prosím biftek stredne prepečený.\r\n- Ja si prosím kuracie stehienka s omáčkou.\r\n- J si prosím bravčový rezeň.\r\nČašník vojde do kuchyne a hovorí:\r\n- Tri krát mäso.', 230, 3.6, 53),
	(11675, 'Otázka na rádio Jerevan:\r\n- Počuli sme, že v Moskve majú mäso. Bude aj v Petrohrade?\r\n- Áno, výstava je putovná.', 121, 3.29, 53),
	(11676, 'Prechádza sa Vladimír Ilič Lenin po Moskve, keď zrazu vidí, ako malé dievčatko plače.\r\n- Prečo plačeš maličká?\r\n- Stratila som kopejku.\r\nTak sa Lenin zľutuje a dievčatku dá kopejku, no dievčatko ďalej plače.\r\n- Prečo stále plačeš?\r\n- Keby som nestratila kopejku, mala by som teraz dve.\r\nLeninovi sa znepáčilo buržoázne chápanie sveta malého dievčatka, tak jej zobral kopejku, aj šatočky, aj topánočky...', 437, 3.13, 53),
	(11677, 'Otázka na rádio Jerevan:\r\nPrečo bol sovietsky systém nemorálny?\r\nPretože predával mlieko po korune.', 106, 2.96, 53),
	(11678, 'Jeden z oblasti vtipov "nových ruských":\r\nDeväť gramov našich investícií a ste nehnuteľnosť.', 101, 2.97, 53),
	(11679, 'Viete, že Rusi vymysleli novú tabletku na chudnutie? Spočíva to v tom, že po jej zhltnutí nemusíte dva týždne nič jesť. Ale má jednu nevýhodu: Je veľká ako koleso z traktora.', 189, 3.12, 53),
	(11680, 'V Rusku sa pýta zahraničný novinár jednoduchého starčeka:\r\n- Dedo, čo budete robiť, keď v Rusku nastane blahobyt?\r\n- Prežili sme vojnu, prežili sme biedu, prežijeme aj blahobyt.', 189, 3.73, 53),
	(11681, 'Husák sa na návšteve v ZSSR spýtal Gorbačova: \r\n- Koľko je u vás ľudí proti socializmu? \r\n- Tak asi 15 miliónov. A u vás?\r\n- Tiež asi toľko.', 153, 3.14, 53),
	(11682, 'Viete ako vyzerá pravý Rusky Hamburger?\r\nDva lístky na chleba a medzi nimy lístok na mäso.', 95, 3, 53),
	(11683, 'Správa v novinách:\r\nNa pokojne orajúci ruský traktor zaútočili neďaleko rusko-činskych hraníc čínsky vojaci. Pokojne orajúci traktor streľbu opätoval a potom vzlietol.', 181, 3.37, 53),
	(11684, 'Viete, ako v Rusku zabíjajú zajace?  \r\nJednoducho zoberú kameň, nasypú naň korenie, zajac príde, kýchne a rozbije si hlavu.', 131, 3.13, 53),
	(11685, 'Stalin sa prechádzal po dedine a uvidel pri potoku ženy. \r\n- Čo robíte, súdružky? \r\n- Perieme prádlo! \r\nStalin sa usmial: \r\n- Len perte, perte, zajtra sa bude vešať.', 174, 3.14, 53),
	(11686, 'Mala loď nabúrala do veľkej ruskej lode. Rusky kapitán vytiahol stroskotancov na palubu a hovorí kapitánovi malej lode: \r\n- Pačimu ty najebál do majevó karabľá?\r\nKapitán pokrčí plecami.\r\n- Sprechen Sie Deutsch?\r\nKapitán nereaguje.\r\n- Parlez vous francais?\r\nKapitán nereaguje.\r\n- Do you speak English?\r\n- Yes Sir !!!\r\n- Yes? Tak pačimu ty najebál do majevó karabľá?', 385, 3.56, 53),
	(11687, 'Stretnú sa dvaja kamaráti po 20 rokoch. Prvý sa pýta druhého:\r\n- Kde si doteraz bol?\r\n- Vo väzení.\r\n- A ako dlho?\r\n- 15 rokov.\r\n- A za čo?\r\n- Za nič!\r\n- Neklam, za to bolo 10 rokov.', 190, 3.07, 53),
	(11688, '- Vieš, že Rusi vynašli takú tabletku, po užití ktorej sa ešte môžeš rozprávať s mŕtvolou pol hodiny?\r\n- A to už ako?\r\n- No má to ešte jednu nevýhodu. Ten mŕtvy ti už neodpovedá.', 198, 3.04, 53),
	(11689, 'Kúpia Rusi od Nemcov motorové píly, ktoré vraj napília za hodinu 10 kubíkov dreva.\r\nPo čase Rusi zavolajú Nemca, lebo nikdy nenapília viac ako 8 kubíkov, že aby im to predviedol.\r\nNemec naštartuje pílu a reže.Prvý, druhý, tretí až desiaty kubík.\r\nKeď skončí Hovorí: \r\n"Tak vidíte že to ide."\r\nRusi nechápavo: \r\n"To sa aj ŠTARTUJE?"', 358, 3.19, 53),
	(11690, 'Viete,kedy pristáli Rusi na Slnku?\r\nV noci.', 44, 3.04, 53),
	(11691, 'Rusi vynašli tabletku, ktorú keď mŕtvemu dáte pod jazyk, môžete sa s ním ešte dve hodiny rozprávať. \r\nJediná nevýhoda je tá, že Vám neodpovedá.', 160, 3.23, 53),
	(11692, 'Rusi vynašli novú tabletku, ktorú keď zjete nemusíte dva roky jesť.\r\nJediná nevýhoda je, že pilulka váži 300kg.', 122, 3.13, 53),
	(11693, 'Interview so Stalinom:\r\n- Pán Stalin, ste zberateľom?\r\n- Áno.\r\n- A, ak sa smiem spýtať, čo zbierate?\r\n- Vtipy o mne.\r\n- A koľko ste ich už zozbierali?\r\n- Tri pracovne tábory.\n', 184, 3.09, 53),
	(11694, 'Článok z Moskovských novín. Ruskí chemici vymysleli vodu v prášku. Bohužial zatiaľ nevedia, čím ju budú zalievať.', 126, 3.08, 53),
	(11695, 'Prečo ruské autorádio v zátačkách nehrá?\r\nLebo sa musia muzikanti držať!!', 82, 3.18, 53),
	(11696, 'Klasický kolorit trans-sibírskej železnice:\r\nDlhé dni nič, len chlad, mráz a nekonečné polia snehu.\r\nA takto uprostred pozemského antiraja zastane vlak.\r\nStoji si už dlho a tak jednému cestujúcemu to nedá a spýta sa sprievodcu, čo sa deje.\r\n"Nič, len meníme lokomotívu", odpovedá mu.\r\nPrejdu dlhé hodiny čakania a stále nič.\r\nUž mierne podráždenejšie sa spýta znova a dostane rovnako flegmatickú odpoveď.\r\n"No menili sme lokomotívu, nevravel som Vám to?"\r\nPo ďalších hodinách sa už zúfalo vyrúti na sprievodcu:\r\n"Je možné, aby vám to toľko trvalo?!"\r\n"Samozrejme, keď my sme ju vymenili za vodku.', 640, 3.05, 53),
	(11697, '- Dobrý deň! Rádio jerevan? Chcel by som sa opýtať, či je to naozaj pravda, že minulú nedeľu na poludnie rozdali na Červenom námestí v Moskve päťdesiat novučičkých moskvičov.\r\nOdpoveď rádia Jerevan: \r\n- Vaše informácie sú správne, len ich treba mierne upresniť. Bolo to v sobotu, v skorých ranných hodinách, na periférií Irkutska, bolo to sto ošarpaných bicyklov a nerozdali ich, ale rozkradli...', 428, 3.34, 53),
	(11698, 'Príde súdruh Brežnev na koncoročný snem ÚVKS ZSSR. Postaví sa za kecpult a otvára si kufrík. Ako ho otvára, vysypú sa mu z neho samé prezervatívy. V sále je obrovský výbuch smiechu. Súdruh Brežnev zapne mikrofón a vraví:\r\n- Dobre som ja vedel, že budem jednať s kurvami!', 292, 3.32, 53),
	(11699, 'Po majstrovstvách sveta v hokeji v oku 1985 prichádza československej vláde telegram od porazených sovietov:\r\nGratulujeme! Stop. Boli ste rovnocenní súperi. Stop.  Ropa. Stop. Zemný plyn. Stop.', 201, 3.41, 53),
	(11700, 'Ako spoznáte, že máte v byte sovietsku plošticu?\r\nMáte o skriňu naviac. ', 78, 4.01, 53),
	(11701, '- Ako sa, prosím vás, dostanem do Moskvy? - pýta sa turista Rusa.\r\n- Tri dni rovno a potom zaboč doprava.', 109, 2.79, 53),
	(11702, 'Na ruskej atómovej ponorke:\r\n- Kto včera utieral prah na odpalovacej doske?\r\n- Ja!\r\n- Tak teraz si vezmite gumu a vygumujte Anglicko z mapy sveta.', 148, 3.3, 53),
	(11703, 'Uteká maslový chlieb po Moskve pred obrovským davom ľudí. Celý spotený dobehne na Červené Námestie a zbadá šnicel. Nechápe, ako je možné, že práve jeho naháňajú, keď obďaleč postáva chutný kúsok mäsa. Dobehne za ním a pýta sa:\r\n- Ako je to možné, že mňa naháňajú a ty si tu len tak stojíš?\r\nA šnicel hovorí:\r\n- Vieš čo, kľudne sa schovaj za mňa. Mňa tu totiž aj tak nikto nepozná.', 427, 3.33, 53),
	(11704, 'V krutých mrazoch bola na Sibír poslaná vojenská jednotka. Veliteľ sa chcel presvedčiť, nakoľko sa vojaci aj tu prejavujú ako muži, dal si nastúpiť jednotku a pýta sa:\r\n- Saldaty, komu stoit?\r\nNajprv sa nikto nehlási, nakoniec sa prihlási vzadu taký štúply vojačik. Veliteľ príde, pozrie, naozaj. Pochváli ho: \r\n- Ty molodec!\r\nNa druhý deň dá takisto nastúpiť jednotku, a znovu sa pýta to isté. Znovu sa prihlási ten istý vojačik. Veliteľ príde, pozrie, naozaj, potľapká ho: \r\n- Molodec, molodec.\r\nNa tretí deň znovu nástup, tá istá otázka, prihlási sa ten istý vojak. Veliteľ sa čuduje, príde, pozrie, naozaj. Pýta sa:\r\n- Kak eto vozmožno, što on postojanno stoit?\r\n- Tovarišč general, on zamjorz!', 750, 3.07, 53),
	(11705, 'Po "zlatých" hokejových MS v Prahe v roku 1985  dostala československá vláda blahoprajný \r\ntelegram aj od bratov zo ZSSR:\r\n"Ste dobrý hokejový tím" STOP.\r\n"Boli ste rovnocenným súperom" STOP.\r\n"Gratulujeme Vám" STOP.\r\n"Ropa" STOP.\r\n"Zemný plyn" STOP.', 263, 3.18, 53),
	(11706, 'Viete, prečo zomrel Stalin?\r\nDostal skrat, keď sa mu zrástlo obočie.', 72, 3.18, 53),
	(11707, 'Prečo teraz tak často lietajú Rusi do kozmu?\r\nLebo nosia Gagarinovi dôchodok!', 81, 3.11, 53),
	(11708, 'Aká je najpopulárnejšia robota v Černobyle?\r\nTrávorubač.', 62, 3.07, 53),
	(11709, 'Aký je rozdiel medzi americkou a ruskou rádiaktivitou?\r\nRuská je neškodná.', 79, 3.14, 53),
	(11710, 'Aký je rozdiel medzi americkou a ruskou ponorkou?\r\nRuská sa musí občas vynoriť, aby sa veslári nadýchli.', 111, 3.48, 53),
	(11711, 'Stretne jeden 110 ročný rus kamaráta a hovorí mu:\r\n- Predstav si, po 90-tich rokoch som stretol spolužiaka zo školy.\r\n- A ako si sho spoznal? - pýta sa priateľ\r\n- Podľa kabáta.', 186, 2.95, 53),
	(11712, 'Čukča nájde pri svojej manželke v posteli svojho kamaráta. Udivene sa ho pýta:\r\n- Voloďa, ja musím, ale prečo ty?', 122, 3.21, 53),
	(11713, 'Do turistickej reštaurácie na Čukotke vošiel cudzinec. Dal si víno a po chvíli musel odskočiť na WC. Keď sa vrátil, všetci hostia sa strašne smiali. Pýta sa barmana:\r\n- Prečo sa všetci smejú?\r\n- Videli ste na toalete veľký plagát krásnej nahej ženy?\r\n- Všimol som si.\r\n- A všimli ste si aj figový list, zakrývajúci zaujímavé partie?\r\n- Ani veľmi nie.\r\n- Viete, vždy keď niekto nazrie pod list, v celej krčme to zazvoní.', 452, 3.28, 53),
	(11714, 'Na malej sibírskej železničnej stanici:\r\n- Dajte mi lístok!\r\n- A kam?\r\n- Akože kam? Predsa do ruky!', 104, 3, 53),
	(11715, 'Čo majú Rusi najväčšie?\r\nMikročipy!', 41, 3.06, 53),
	(11716, 'Čukča prišiel do Moskvy na ministerstvo. Bafkal si z fajky a raz napravo, raz naľavo si odpľúval. Zriadenec pchal pred neho pľuvátko, ale on aj naďalej pľuje vedľa. Keď mu to stále zriadenec pchá pod nos, zvolá:\r\n- Dajte preč tú misku, lebo vám do nej napľujem.', 280, 3.04, 53),
	(11717, 'Telefonuje Jeľcin Clintonovi:\r\n- Pán Clinton, chcel by som vám vyjadriť úprimnú sústrasť k stroskotaniu vášho raketoplánu.\r\n- Ale náš raketoplán odštartuje až za 5 minút.\r\n- Aha, tak zavolám neskôr.', 217, 3.32, 53),
	(11718, 'Reklama na rádiu Jerevan:\r\nRuské hodinky - najrýchlejšie na svete!', 70, 2.97, 53),
	(11719, 'V Rusku postavili velikánsku budovu, niečo ako RVHP. Budova im však spadla. Hľadali teda vinníka.\r\n"Tehly, vy ste na vine!"\r\n"Nie, my nie sme na vine, my sme vypálené z tej najlepšej hliny."\r\n"Štrk, ty si na vine!"\r\n"Nie, je nemôžem byť na vine, veď som vybagrovaný z najlepších riek."\r\n"Cement, ty si na vine."\r\n"Nie, nie som, ja som tam vôbec nebol."', 369, 3.15, 53),
	(11720, 'V moskovskom parku v časoch socializmu neznámy človek vraví malému chlapcovi:\r\n- Tu je sto mariek, choď ich rozmeniť, počkám ťa tu!\r\nChlapec sa nedôverčivo pozrie na neznámeho a opýta sa:\r\n- A vy mi za ten čas neujdete?', 234, 3.03, 53),
	(11721, 'Počas protialkoholickej kampane Gorbačova lekár na osvetovej besede demonštruje škodlivosť alkoholu:\r\n- Všimnite si, prosím, v tomto pohári je čistá voda, hodím do nej červíka a on sa čulo pohybuje. Teraz ho vyberiem a vložím do pohára s alkoholom. Červík sa pohybuje pomaly, až napokon zdochne. Čo to znamená?\r\nPrihlási sa dedko:\r\n- Máte pravdu, pán doktor, ja už 60 rokov pijem alkohol a červíkov som ešte nemal.', 444, 3.71, 53),
	(11722, 'Spytuje sa vnúčik deduška:\r\n- Deduško, a vy ste poznali Iľju Muromca?\r\n- Vieš Koľja, keď som bol ešte nevzdelaným mužíkom a obrábal som našu matičku Rus dreveným pluhom zrazu sa slnko skrylo a čo ja vidím. Na koni sedí jasné slniečko Rusi, bohatier smelý, junák odvážny, Iľja Muromec. Flintičkou na mňa mieri a milým hlasom sa mi prihovorí - Mužík, vyser sa a zjedz to. Čo som mal robiť, Koľja? Flintička na mňa mierila, nuž som sa vysral a zjedol som to. Bohatier sa tak začal smiať až z koňa zletel. Flintička mu vypadla z ruky. Ja som ju zodvihol, namieril na neho a milým hlasom som mu povedel - Iľja Muromec, vyser sa a zjedz to. Čo mal robiť, Koľja? Flintička na neho  mierila, nuž tak sa vysral a zjedol to. Koľia a ty sa ma pýtaš či poznám Iľju Muromca? Samozrejme že poznám, veď sme spolu obedovali!', 867, 3.83, 53),
	(11723, 'Je chladné jesenné ráno. Na Volge prerazí hustú hmlu čln, vzadu sedí Marfuša a vesluje proti prúdu až sa jej copy potia. Vpredu sedí Ivan Vasiljevič a spokojne bafká z fajky. Vtom v opačnom smere sa objaví iný čln, na ňom vesluje Kužma Trofimyč a volá:\r\n"Kamže to ideš, Ivan Vasiljevič, takto skoro ráno?"\r\nIvan Vasiljevič vyberie z úst fajku, vyfúkne dym a odpovedá:\r\n"Ále, kamže by som šiel, veziem manželku do pôrodnice..."', 460, 3.06, 53),
	(11724, 'Ako to bývalo v ZSSR pred 1989?\r\nPolovica ľudí stala v rade a druhá sedela vo väzení.', 91, 3.19, 53),
	(11725, 'Z ruskej Biblie: "Na začiatku sa súdruh Boh prechádzal po uliciach Moskvy..."', 80, 2.92, 53),
	(11726, 'Rok 1969. Cigáň uteká do Nemecka a na hranici ho chytia vojaci.\r\n- Kam utekáš, cigáň?\r\n- Do Sovietskeho zväzu.\r\n- Neklam, veď to by si musel ísť na východ.\r\n- Láska k Sovietskemu zväzu nepozná hraníc.', 216, 3.14, 53),
	(11727, 'Bush chce vedieť, ako to tu bude vyzerať o 100 rokov. Keď ho v roku 2102 rozmrazia, tak sa prechádza po ulici a pýta sa občana.\r\n- Bola už tretia svetová?\r\n- Jasnačka.\r\n- A kto vyhral? My alebo Rusi?\r\n- Jasnačka, že mi.\r\n- A vyrába sa tu ešte Coca -Cola?\r\n- Jasnačka.\r\n- A koľko stojí?\r\n- 3 ruble. ', 314, 3.52, 53),
	(11728, 'Viete ako zistíte že máte v dome ruskú plošticu?\r\nMáte doma o skryňu naviac.', 83, 3.03, 53),
	(11729, 'Vdova po Leninovi Nadežda Krupská počas posledných rokov poriadne liezla Stalinovi na nervy. Preto si ju zavolal a povedal:\r\n- Alebo prestaneš tárať, alebo menujeme vdovou po Leninovi niekoho iného.', 206, 2.9, 53),
	(11730, 'Podľa oficálneho vyhlásenia ruských predstaviteľov bola pravdepodobnou príčinou požiaru TV veže Ostankin zrážka s cudzou výškovou budovou.', 151, 3.02, 53),
	(11731, 'Poznáte ruský hamburger? \r\nDva lístky na chlieb a medzi nimi lístok na mäso.', 81, 3.12, 53),
	(11732, 'Ide Brežnev po Červenom námestí a vidí, ako sa chlapec hrá futbal s jednou topánkou na nohe a hovorí mu:\r\n- Ty si jednu topánku stratil, však?\r\nChlapec na to:\r\n- Nie, našiel.', 185, 3.06, 53),
	(11733, 'Sovietsky vojak si dohodne rande s peknou nemkou a keď majú už obaja chuť, tak sa vyzlečú. Vojak pri pohľade na nemku zistí, že ona ju má úplne vyholenú a povie: \r\n- Dievočka a kde máš vlnu?\r\nOna pozrie na neho a odpovie:\r\n- Ty chceš šukať alebo pliesť sveter?', 279, 2.99, 53),
	(11734, 'Kolchozník Serioža plnil plán v kosení pasienkov na sto percent. Aby ho splnil na dvesto percent, namontoval si na kosisko ešte jednu kosu a kosil tak na obidve strany. A aby plán splnil na tristo percent, zozadu si na remeň nohavíc uviazal hrable a hneď za sebou aj zahrabával. Takého zlepšovateľa bolo treba predstaviť aj v televízii, nuž zavolali televízny štáb. Akonáhle ich však Serioža uvidel, odhodil kosu i hrable a utekal ozlomkrky preč. Keď ho nakoniec chytili v krčme, svoj útek vysvetlil:\r\n- Keď som vás zbadal s tým reflektorom, zľakol som sa, že mi ho namontujete na citlivé mužské miesto, aby som robil aj nočné smeny!', 669, 3.32, 53),
	(11735, '- Šéfe, nemohol by som dnes odísť o hodinu skôr? Žena by chcela, aby sme išli nakupovať.\r\n- To neprichádza do úvahy. Vy ako člen KSSZ by ste mali byť ostatným príkladom v pracovnej disciplíne!\r\n- Ďakujem šéfe. Hneď som vedel, že sa na vás môžem spoľahnúť.', 281, 2.98, 53),
	(11736, 'Na jaltskú konferenciu prišiel aj Boh. Usadili ho na najlepšie miesto v sále. Postupne prichádzali ďalší účastníci. Prišiel Churchill. Boh sa postavil a podal mu ruku. Takisto privítaj aj Roosevelta. Keď však prišiel Stalin, podal mu ruku posediačky. Stalin sa urazil:\r\n- Prečo ste sa nepostavili, Otče, keď ste ma zdravili?\r\n- Jožko môj, myslíš, že ťa nepoznám? Ja sa postavím a ty si hneď sadneš na moje miesto!', 443, 2.97, 53),
	(11737, 'Na transsibískej magistrále zastane vlak.\r\n"Što slucilos?!"\r\nKričia cestujúci.\r\n"Zamenájem mašínu."\r\nPo pol hodine vlak stále stojí.\r\n"Što slucilos?" \r\nZnova kričia cestujúci.\r\n"Uže zamenili mašínu?" \r\n"Da zamenili, za vodku."', 242, 3.36, 53),
	(11738, 'Ruská Viagra?\r\nNo predsa 10 cm kliniec do penisu a magnet na čelo.', 68, 3.09, 53),
	(11739, 'Počas protialkoholickej kampane v Sovietskom zväze stojí rad na vodku, stojí hodinu, stojí dve hodiny. A tu jeden chlapík vraví:\r\n- Už to ďalej nevydržím. Gorbačov je mizera, podviedol nás. Pôjdem a zastrelím ho.\r\n- Áno, urob to, - prikyvovali ľudia v rade.\r\nA tak šiel. Za štyridsať minúť bol však späť.\r\n- Tak čo, zabil si ho?\r\n- Ále, tam je ešte väčší rad ako tu.', 398, 3.01, 53),
	(11740, 'Advokát, člen KSSZ, je na smrtelnej posteli. Rodina mu zavolá kňaza, ktorý sa ho pýta:\r\n- Chcete sa zmieriť so Stvoriteľom?\r\n- Áno, -odpovedá advokát. - Len, prosím vás, urobte návrh. Ja som poškodená strana.', 224, 2.87, 53),
	(11741, 'Ako zabíjajú na Sibíri zajace?\r\nZasunú do snehu mrkvu so žiletkou. Príde zajac, postaví sa nad mrkvu a povie: "Hmm,hmm mrkva v zime?"\r\nPríde druhý zajac a povie: "Hmm, hmm zajac bez hlavy?"\r\nA majú dvoch zajacov.', 222, 3, 53),
	(11742, 'V Moskve stretne Ivan Naťašu, ktorá nesie zabalenú rybu v novinách. Ivan sa jej pýta:\r\n- Nataša, čo nového v novinách.\r\n- Ryba. ', 138, 2.84, 53),
	(11743, 'Úvod ruskej biblie:\r\nA na počiatku nebolo nič, iba súdruh Boh sa prechádzal ulicami Moskvy.', 96, 3.25, 53),
	(11744, 'Na Ruskej vojenskej základni prebieha cvičenie výsadkárov.\r\nSerioža je strašný smoliar a samozrejme, keď vyskočí z lietadla nedarí sa mu otvoriť padák. Ako tak letí voľným pádom, 300 metrov nad zemou zbadá, že sa zdola proti nemu rúti iný vojak.\r\nKričí naňho:\r\n- Tavááárišč neznaješ kak étot odkryváetsja?\r\nA zdola letiaci mu odpovedá:\r\n- Neznájúúú ja pyroťecnik!', 401, 3.27, 53),
	(11745, 'Francúzska pre vysokú konkurenciu v Paríži sa vybrala zarobiť si prostitúciou do Moskvy. Prvý večer sa poprechádzala po Červenom námestí, muži si ju však nevšímali, pozornosť venovali Leninovmu múzeu.\r\nDruhý večer si zastala pred hotel. Po dlhom čase, keď jej začalo byť už zima, všimla si ju babka, darovala jej plášť a zobrala k sebe prespať, že určite sa stratila.\r\nTretí večer sa rozhodla pre radikálny krok. Na verejnosti sú Rusi zrejme ostýchaví, skúsi to v parku. Sadla si na lavičku, stiahla nohavičky a zavesila ich na krík. Čakajúc však zaspala. Keď sa ráno zobudila, našla nohavičky poskladané na lavičke s priloženým lístkom:\r\n\'Nohavičky sú vypraté a vyžehlené. Timur a jeho družina.\'', 756, 3.25, 53),
	(11746, 'Žiaci mali raz suplovanú hodinu občianskej náuky s telocvikárom a preberali Leninove výroky. Keď ich z nich na ďalšej hodine už kompetentný učiteľ skúšal, odpovedali:\r\n- 5. januára Lenin povedal: učiť sa, učiť sa, učiť sa! \r\nUčiteľ prikývol. Trochu bol síce zaskočený dátumom výroku, o ktorom nič nevedel, ale nechal to tak. Keď však i ďalší žiaci svoje odpovede začínali slovami: 5. januára Lenin povedal, rozsvietilo sa mu v hlave, odišiel za telocvikárom a vraví mu:\r\n- Somár! V. I. neznamená 5. január, to sú iniciály mien Vladimír Iľjič.', 593, 3.08, 53),
	(11747, 'Lenin zomrel a stojí pred svätým Petrom. Nechali ho v očistci a Svätému Petrovi prikázali na neho dozerať. O týždeň sa ho Boh pýta:\r\n- Tak ako prebieha Leninov očistec?\r\n- Výborne, súdruh Boh! - odpovedal Svätý Peter.', 234, 3.19, 53),
	(11748, '- Prečo sa čerti boja púšťať komunistov do pekla?\r\n- Boja sa, že tam začnú budovať raj.', 97, 3.43, 53),
	(11749, 'Jedného dňa sa Ronald Reagan  zobudil s hrôzou v očiach, celý spotený, biely ako krieda: \r\n- Sníval sa mi strašný sen, ozajstná nočná mora, - hovorí svojmu komorníkovi. - Predstav si, John, práve prebiehal XXX. zjazd KSSZ. Zrazu sa predseda postavil a vyhlásil:\r\n- A teraz má slovo prvý tajomník kalifornského oblastného výboru strany, súdruh Ronald Reagan! A ja... ja som nebol vôbec pripravený!', 421, 2.99, 53),
	(11750, 'Počas vojny chytili čečenci troch špiónov- Američana, Nemca a Rusa. Začnú ich týrať rôznymi spôsobmi. Američan vydrží jeden deň, Nemec dva dni ale Rus ani po týždni nepovolil. Keď ani po siedmom dni čečenci neuspeli a vychádzali z väznice, počujú len výkriky a hrozný buchot. Rus si búchal hlavu o stenu zo slovami:\r\n- Ivan, spomeň si lebo ťa zabijú.', 381, 3.39, 53),
	(11751, 'Ako zomrel básnik Majakovskij?\r\nSpáchal samovraždu.\r\nA aké boli jeho posledné slová pred smrťou?\r\n\'Nestrieľajte, súdruhovia!\'', 134, 3.08, 53),
	(11752, 'Otázka na rádio Jerevan:\r\n- S kým hraničí ZSSR?\r\n- S kým chce, s tým aj hraničí.', 89, 3.31, 53),
	(11753, 'Texasan prišiel na dovolenku na Ukrajinu. Ako tak prechádzal na Lincolne cez dedinu, zbadal miestneho mužíka, ako bije svoju ženu. Vydal sa to oznámiť na milíciu. Milicionéri okamžite sadli do gázika a mužíka predviedli na stanicu. Pri konfrontácii sa veliteľ milície pýta mužíka:\r\n- Kuzma, tuto súdruh z Texasu ťa vraj videl, ako biješ svoju ženu. Ako nám to vysvetlíš?\r\n- Pán veliteľ, keď ona mojim novým Mercedesom prerazila živý plot, vletela do domu, preletela cez obývačku až skončila v mojom novom bazéne. No uznajte!\r\nTexasan: \r\n- Tak toto teda je dôvod! Ja by som jej to tiež spočítal! \r\nTexasan, spokojný s tým, že vyriešil záhadu, odišiel. Veliteľ sa pýta Kuzmu:\r\n- Počuj, Kuzma, aký Mercedes? Aký dom? Aký bazén? O čom to tu rozprávaš?\r\n- To som sa mu mal priznať, že mi stratila lístky na dreváky?', 871, 3.11, 53),
	(11754, 'Pýtali sa Lenina, či je správne aby mal ženatý muž milenku.\r\n"Je to skvelá vec.",\r\nodpovedal Lenin.\r\n"Ja poviem manželke, že som u milenky, milenke, že som u manželky a ja šup do knižnice."', 202, 3.38, 53),
	(11755, 'Sovietske hodiny do každej rodiny: najväčšie, najťažšie a najrýchlejšie!', 81, 3.14, 53),
	(11756, 'Člen KGB sa pýta v bare chlapa:\r\n- Koľko je 2+2?\r\n- To ja predsa 4.\r\nAgent ho zastrelí. Barman sa ho pýta:\r\n- Veď to je správne. Tak prečo?\r\n- Vedel príliš mnoho.', 172, 3.06, 53),
	(11757, 'Oznam v rádiu Jerevan: \r\nRuským vedcom sa podarilo skrížiť zlatú rybku so žralokom. Tento vzniknutý jedinec vám splní posledné tri želania.', 151, 3.35, 53),
	(11758, 'V Rusku v taxíku:\r\n- Pán taxikár veď poďme, nestojte, máme zelenú!\r\n- Nemogu, idut geroji!\r\nA naozaj, z vedľajšej ulice preletia na červenú autá v plnej rýchlosti. \r\n- Pán taxikár, pre boha stojte, veď nám naskočila červená!\r\n- Ja tože geroj!', 263, 2.99, 53),
	(11759, 'Jeden Rus telefonuje priateľovi:\r\n"Príď si ku mne zahrať šachy!"\r\n"Nemôžem, musím ryľovať záhradu."\r\nTak vytočí KGB:\r\n"Ten a ten na záhrade niečo zakopával."\r\nZa chvíľu tam prišlo komando, poryli celú záhradu, nič nenašli tak odišli. A znovu ten prvý telefonuje:\r\n"Mal si tam KGB?"\r\n"Mal."\r\n"A záhradu porýľovali?"\r\n"Porýľovali."\r\n"Tak príď ku mne na partičku!"', 394, 4.28, 53),
	(11760, 'Lenin sa vyšplhá na korbu nákladného auta. Dav ľudí okolo pokrikuje.\r\n- Nech žije Lenon, nech žije Lenon!\r\n- Ja nie som Lenon, ja som Lenin.\r\n- Nech žije Lenon!!!\r\n- Ja som Vladimír Iljič Lenin!\r\n- Lenóóón.\r\n- Tak dobre, ako chcete. Yesterday...', 259, 3.04, 53),
	(11761, 'Jeľcinovi prišiel telegram z Ruskej Dumy:\r\n"Vážený pán prezident! Parlament vám praje skoré uzdravenie v počte 202 hlasov proti 195."', 142, 3.3, 53),
	(11762, '"Súdruh Stalin, aké máte hobby?"\r\n"Zbieram vtipy o mne."\r\n"A koľko ich už máte?"\r\n"Asi tak dva a pol gulagu."', 115, 2.99, 53),
	(11763, 'Skupinový sex v Moskve, keď zrazu sa ozve mužský hlas:\r\n- Nada organizovať, nada organizovať!\r\n- Pačemu?\r\n- Menia uže dva raza posmilnili a iščo nikavo.', 162, 2.97, 53),
	(11764, 'Zomrel Černenko a pri rajskej bráne ho čaká Brežnev:\r\n"Leonid Iľjič, kde ste, v nebi, alebo v pekle?"\r\n"V pekle. Ale môžeš si aspoň vybrať buď kapitalistické alebo socialistické.\r\n"A vy ste v akom?"\r\n"V socialistickom."\r\n"Prečo? Hádam nie z patriotizmu?"\r\n"Ale kdeže! Raz nedovezú síru, inokedy opravujú kotol, potom je zase kurič ožratý, skratka pohoda."', 379, 3.52, 53),
	(11765, 'Na čínsku hranicu príde ruský bohatier:\r\n"Ej, sto tisíc číňanov, poďte za kopec, bojovať so mnou!"\r\nSto tisíc číňanov išlo za kopec, po hodine výjde spoza kopca ruský bohatier a zase kričí:\r\n"Heej! Sto tisíc číňanov, poďte so mnou bojovat!"\r\nA zase ide sto tisíc číňanov za kopec a po hodine zase výjde bohatier:\r\n"Ďalších sto tisíc číňanov, poďte so mnou bojovať!"\r\nAle spoza kopca sa plazí jeden neporiadne dobitý číňan a z posledných síl kričí na svojich:\r\n"Chlapi! Nechoďte tam! Je to pacsa! Sú dvaja!"', 555, 3.52, 53),
	(11766, 'Jeden Rus sa vrátil z cesty po západnej Európe:\r\n"Tak rozprávaj! Ako bolo?"\r\n"Výborne! Všetko naokolo čisté, žiaden smrad, všetko funguje, skrátka radosť žiť. Ale pre normálneho Rusa to nie je."\r\n"Prečo?"\r\n"Predstav si, že ráno vstaneš, pozrieš z okna, a plné mesto Nemcov!"', 295, 3.05, 53),
	(11767, 'Konala sa súťaž "Čo vieš o  sovietskom zväze".\r\nKto ju vyhral?\r\nAgenti CIA.', 81, 3.34, 53),
	(11768, 'V moskovskej galérii visí obraz, na ktorom je lúka, na lúke stoh sena a zo stohu trčia dva páry nôh v jednoznačnej polohe.\r\n"Ako sa volá tento obraz?" pýta sa návštevník.\r\n"Lenin vo Fínsku."\r\n"Aha. A tie nohy špičkou hore sú Leninove?"\r\n"Nie, to sú nohy Nadeždy Krupskej."\r\n"Takže tie nohy špičkou dole sú Leninove?"\r\n"Nie, to sú nohy Leonida Trockého."\r\n"A kde je potom Lenin?"\r\n"Vo Fínsku."', 418, 3.08, 53),
	(11769, '"Bačááá!"\r\n"Čooooo?"\r\n"Bačááá, Brežnev zomrel!"\r\n"Čooooo?"\r\n"Brežnev zomrel!"\r\n"Ahá, a na ktorej holi pásol?"', 123, 2.9, 53),
	(11770, 'Letí ruské lietadlo. \r\nZa ním druhé, tiež drevené.', 56, 2.79, 53),
	(11771, 'Do ruského závodu príde kontrola a kontrolór sa pýta robotníka.\r\n- Nuž tovarišč,keď vypiješ pol deci vodky môžeš pracovať?\r\n- A robotník na to no čo by som nemohol,môžem.\r\n- A keď vypiješ dve deci môžeš pracovať?\r\n- No môžem.\r\n- A keď vypiješ pol litra?\r\n- Môžem.\r\n- A keď vypiješ celú fľašu?\r\n- A čo nepracujem?', 349, 2.91, 53),
	(11772, 'Prídu k najstaršiemu obyvateľovi Sovietského zväzu novinári a pýtajú sa ho:\r\n- Akim Akimovič , ako je to možné, že ste sa dožili neuveriteľných 150 rokov a tak výborne vyzeráte? \r\n- Ale viete u nás po tej revolúcii v roku 1917... \r\n- Akim Akimovič, prerušia ho novinári, nechajte propagandu propagandou a povedzte nám, ako je to možné, že ste sa dožili 150 rokov? \r\n- Ale viete u nás po tej revolúcii... \r\n- Akim Akimovič, znova ho prerušia novinári, nechajte propagandu a odpovedzte na otázku! \r\n- Tak ma nechajte dohovoriť!, okríkne ich Akim Akimovič. \r\nTak sa novinári dohodnú, že to potom vystrihnú, ak bude rozprávať somariny. \r\n- No,začne Akim Akimovič, u nás na tom MNV po tej revolúcii v roku 1917 bol taký bordel, že mi ktosi pripísal 100 rokov.', 803, 3.86, 53),
	(11773, 'Je ráno.Slniečko sa zobudí, ponaťahuje si rúčky a nôžky.Ide pozdraviť\r\nLeonida Brežneva. Zaklope mu na okienko:" Ako si sa vyspal Leonid?"\r\n"Dobre slniečko."\r\n"Čo máš dnes na programe Leonid?"\r\n" Ako vždy, štátnicke záležitosti."\r\n" A ešte niečo Leonid ,aj keď sa pošerieš večer budem na ZÁPADE."', 322, 3.29, 53),
	(11774, 'Na sovětsko-čínskych hranicích napadla skupina čínskych\r\ntankú sovětsky, klidne orajíci traktor. Tento palbu\r\nopetoval, a po zničení všech tankú odletel zpet na základnu.', 184, 3.45, 53),
	(11775, 'US rádio, rok 2100, správy.\r\nZ domova: Voľby do parlamentu vyhrala s prevahou komunistická strana.\r\nZo sveta: Na čínsko-fínskych hraniciach sa už dva týždne nebojuje.', 176, 3.23, 53),
	(11776, 'Hviezdne mestečko, výcvik kozmonautov. Interkom zachrchle:\r\n- Semjon Semjonovič sa dostaví na cvičenie na centrifúge. Ihneď!\r\nLenže ako? Semjon Semjonovič leží opitý ako delo v posteli. Tak sa jeho manželka obetuje, natiahne si skafander, odkráča k centrifúge, sadne si, pripúta sa. Stroj sa točí stále rýchlejšie a rýchlejšie, až chudera manželka omdlie. Preberie sa na lekárskom stole, ktosi jej mačká prsia a upokojujúco hovorí:\r\n- Nebojte sa, Semjon Semjonovič, my tie gule dole dostaneme! ', 526, 3.22, 53),
	(11777, 'Na ruskom vojenskom výcviku.\r\n- Iľja, hádž granát!\r\n- Ja hádžem, komandír a vy chytáte?', 96, 2.89, 53),
	(11778, 'Rozhovor z temného zákouti Moskvy:\r\n"Ja tebja ľubľju."\r\n"Ja tebja tože."\r\n"Ja Ivan."\r\n"Ja tože."', 102, 3.13, 53),
	(11779, 'Přijede američan do Moskvy, koupí si noviny a tam prázdná stránky. Zastaví nějakého občana a ptá se ho.\r\n"Počemu net bukev v gazete?"\r\n"Nenado, vsjo jasno."', 168, 3.05, 53),
	(11780, 'Keď boli nepriateľské čaši medzi ZSSR a Čínou, prišlo do Moskvy, do hlavnej budovy KGB, vrece plné maku a v ňom tabuľka: Toľko nás príde! Mao Ce Tung.  Asi o týždeň prišlo to isté vrece naspäť do Pekingu. Otvoria ho a v ňom pomletý mak a tabuľka: A to to s vami urobíme! Stalin.', 303, 3.3, 53),
	(11781, 'V parku v Rusku sa učí chlap hebrejčinu. Príde k nemu policajt a pýta sa ho:\r\n- Na čo sa to učíš? Mi ťa tam aj tak nepustíme.\r\n- Ale ja sa to neučím preto, aby som sa dohovoril v Izraeli, ale keď sa dostanem do neba, aby som sa dohovoril.\r\n- A čo keď sa dostaneš do pekla?\r\n- Po rusky už viem. ', 312, 3.1, 53),
	(11782, 'Telefonuje Angličan s obyvateľom Moskvy.\r\nAngličan: - Ževraj je u vás -60 stupňov.\r\nRus: - Ale kde, u nás je -30.\r\nAngličan: - Ale na CNN hlásili -60!\r\nRus: - Ahaaa, tak to mysleli asi vonku. ', 201, 3.46, 53),
	(11783, 'Stretne sa Američan, Nemec a Rus. Američan hovorí:\r\n- My keď zasadíme zemiaky v maji, už ich kopeme júli.\r\nNemec hovorí:\r\n- My keď zasadíme zemiaky v maji, už ich kopeme júni.\r\nA Rus hovorí:\r\n- My keď zasadíme zemiaky 1.mája, už ich kopeme 2.mája.\r\nAmeričan a nemec sa pýtajú, že prečo tak skoro.\r\n- To viete, hlad je hlad.', 346, 3.11, 53),
	(11784, 'Američania donesú rusom novú motorovú pílu, nech ju dajú silným ruským chlapom na skúšku. Na prvý deň, rus ide s pílou do lesa, do večera napíli 50 kubíkov dreva. Američania sa divia, ako je to možné, veď oni ledva napília 48. Na druhý deň ide druhý rus a napíli 70 kubíkov dreva. Američania zhrození, ako to dokáže jeden človek toľko napíliť. Na tretí deň tam s rusom pošlú aj američana, američan naštartuje pílu a rus sa nechápavo pýta: \r\n- Eto što?', 496, 3.17, 53),
	(11785, 'Vieš, ako sa povie po rusky korytnačka?\r\nTvrdý žab.', 55, 3.02, 53),
	(11786, 'Viete, ktoré hodinky sú najlepšie?\r\nRuské zn. RAKETA - sú najrýchlejšie!', 79, 2.98, 53),
	(11787, 'ISS 300 km nad Zemou. Ivan kričí na Vasiliho:\r\n- Už zavri to okno, začína tu byť prievan!', 95, 2.87, 53),
	(11788, 'Je to červené a lezie to zo zeme do zeme. Čo je to?\r\nUdatná sovietska armáda.', 82, 3.12, 53),
	(11789, 'Rozprávajú sa Nemec, Američan a Rus už po smrti v nebi, že kto mal najhoršiu smrť. \r\nNemec hovorí: \r\n"Ja som mal strašnú smrť, dostal som na narodeniny novú motorku, išiel som sa povoziť a zabil som sa."\r\nAmeričan hovorí:\r\n"Ja som dostal na Vianoce lietadlo, hneď som ho išiel vyskúšať, letel som nízko a zabil som sa." \r\n"To je nič", - hovorí rus, "môj brat dostal bicykel a ja som zomrel od hladu."', 425, 3.21, 53),
	(11790, 'Aké boli posledné slová v Černobyle? \r\n"Vypni to ty idiot ! Nejde to..."', 76, 3.1, 53),
	(11791, 'Americký archeológovia začali kopať pod New-Yorkom 10 km do zeme. Našli kovový drôt. Z tohto perfektného nálezu usúdili, že pred 10 000 rokmi bolo v Amerike telefonické spojenie. Ich ruský kolegovia začali kopať 20 km pod Moskvou a nenašli nič. Z tohto super nálezu zistili že pred 20 000 rokmi bolo v Rusku bezdrôtové spojenie.', 349, 3.32, 53),
	(11792, 'Viete aký je rozdiel medzi francúzskym a ruským milovaním?\r\nFrancúzske sa robí bez spodnej bielizne a ruské bez posteľnej bielizne.', 139, 2.87, 53),
	(11793, 'Dvaja rusky inžinieri plnia raketoplán palivom. Jeden z nich hovorí: \r\n- Počúvaj, to palivo smrdí ako vodka.\r\nDruhý trochu odleje, ochutná a hovorí: \r\n- To palivo chutí ako vodka.\r\nTak obidvaja vychlastajú polovicu nádrže. Na druhý deň ráno telefonuje jeden druhému:\r\n- Sergej, už si si prdol? \r\n- Ešte nie, prečo? \r\n- Tak to ani nerob, lebo ja volám z Tokia.', 380, 3.51, 53),
	(11794, '"Veža, tu Boeing 747 na trase Boston - New York, vypadli nám všetky motory, čo máme robiť?"\r\n"Veža, tu Boeing 747 na trase Boston - New York, vypadli nám všetky motory, čo máme robiť? Ozvite sa!"\r\n"Tu veža, pokoj, už vás škrtám!"              ', 260, 3.8, 53),
	(11795, 'Čo robí izraelské dievčatko, keď sa hojdá na hojdačke?\r\nDráždi palestínskeho ostrelovača.              ', 114, 3.36, 53),
	(11796, 'Hot News:\r\nPribližne pred hodinou vydal Afganistan dlho hľadaného teroristu Usámu bin Ládina.\r\nŽiaľ, iba na známkach...              ', 141, 3.4, 53),
	(11797, 'George Bush vystupuje pred Bezpečnostnou radou OSN\r\na presviedča ich o nevyhnutnoti útoku na Irak. V rozprave sa prihlási francúzsky zástupca:\r\n"Pán Bush, vy ste tak nenormálne hlúpy, alebo ste zhulený?"\r\n"Môžem vás uistiť, že zhúlený nie som."              ', 275, 4, 53),
	(11798, 'Príde kapitán Titaniku k námorníkom a hovorí im:\r\n"Mám pre vás dve správy, jednu zlú a druhú dobrú, ktorú chcete počuť ako prvú?"\r\n"Tú dobrú."\r\n"Dostaneme 11 Oskarov!"              ', 198, 3.8, 53),
	(11799, 'Viete prečo Chelsie Clintonová nemá súrodencov?\r\nLebo tá sviňa Monika Lewinská jej všetkých požrala!              ', 124, 4.2, 53),
	(11800, '- Fíha, máte peknú košeľu.\r\n- Ďakujem, je z Paríža !\r\n- A ďaleko je to od Odesy ?\r\n- Asi 5000 km.\r\n- Predstavte si! Taký zapadákov a také pekné košele!              ', 179, 4, 53),
	(11801, 'Čím sa preslávil Columbus?\r\nŽe sa dostal do Ameriky bez víz.                ', 81, 3.55, 53),
	(11802, 'Stretnú sa tri žraloky. Jeden hovorí: \r\n- Predstavte si, zožral som Maďara a ešte stále ma páli zadok. \r\nDruhý:\r\n- To nič nie je, ja som zožral ruského generála, a vieš ako to bolí keď kakám tie metály? \r\nTretí:\r\n- To nič nie je, ja som zožral slovenského policajta, a ten bol taký dutý, že sa doteraz nemôžem ani ponoriť.\n', 351, 3.9, 53),
	(11803, 'Tatko Škót píše list svojmu synovi - študentovi:\r\nMilý Džon!\r\nPosielam ti tých 20$, o ktoré si tak stál. Ale zapamätaj si už konečne jednu vec: číslo dvadsať sa píše s jednou nulou, a nie s dvomi!              ', 228, 3.75, 53),
	(11804, 'Čo urobí ľudožrút, keď sa zbaví svojej milenky?\r\nUtrie si zadok.\n', 72, 3.56, 53),
	(11805, 'Dvaja ľudožrúti na púšti nájdu kostru:\r\nAha, chrumky!              ', 73, 3.71, 53),
	(11806, 'Američan a Rus si telefonujú:\r\n"Ivan, v televízi hovorili, že tam u vás sú hrozné mrazy, cez -60 stupňov."\r\n"To je hlúposť, najviac tak -20."\r\n"No nie, teraz to hovorili na CNN, vraj cez -60."\r\n"Ale no tak, možno niekde majú -25, ale to skôr výnimočne."\r\n"No ale tie zábery boli hrozné, tie omrznuté stromy, baráky ..."\r\n"Jáj, ty myslíš vonku ?!! No tak to áno."              ', 399, 4.25, 53),
	(11807, 'Eskymák na  svoju ženu: \r\n"Čím si zabila toho medveďa, čo leží pred iglu?" \r\n"Tým bumerangom, čo si mal na posteli." \r\n"Ešte raz mi siahneš na ponožky a zlomím ti deku!!!" \n', 187, 4.2, 53),
	(11808, 'Bin Ládin navštívi jasnovidku, ktorá mu veští:\n"Vidím budúcnosť, umrieš v deň amerického štátneho sviatku."\n"V deň vďakyvzdania?"\n"To je úplne jedno, kedy zomrieš, \nv Amerike to bude štátny sviatok."              ', 233, 4.2, 53),
	(11809, 'Aký je najpopulárnejší šport v Rusku?\n-Tenis.\nLebo na každého Rusa pripadajú dve rakety.              ', 110, 3.5, 53),
	(11810, 'Škót opravuje elektrickú zásuvku. Manželka mu radí: \r\n"Vypni si poistky, veď ťa to môže zabiť!"\r\n"Nemôže, ešte som neodovzdal daňové priznanie."              ', 174, 3.4, 53),
	(11811, 'Ku Škótovi prišiel na návštevu kamarát. Škót mu vraví:\r\n"Prepáč, nečakal som ťa, mám tu zimu lebo som zakúril iba pre jedného."              ', 157, 3.62, 53),
	(11812, 'Príde Škót na poštu a pýta sa:\r\n"Je pravda, že pri odosielaní telegramu sa za meno nič neplatí?"\r\n"Áno, samozrejme."\r\n"Tak dobre, ja sa volám MarekprídevsoboturánoDavid."              ', 197, 3.5, 53),
	(11813, 'Chu, Bu a Fu sa vybrali emigrovať z Číny do USA. Chu si začal hovoriť Chuck, Bu si začal hovoriť Buck a Fu sa radšej vrátil do Číny.              ', 157, 4.1, 53),
	(11814, 'Cudzinec príde do texaského mesta a pýta sa staršieho kovboja:\r\n"Kde je tu holičstvo?"\r\n"Tak to musíte ísť tam za roh a potom vás už povedú krvavé škvrny na chodníku."              ', 195, 3.43, 53),
	(11815, 'Rok 1953. Zväz sovietskych socialistických republík.\r\nStalin volá Berijovi:\r\n”Lavrentij Pavlovič, nevideli ste moju fajku? Nemôžem ju nájsť.”\r\n”Nevidel, ale pohľadám ju, Josif Vissarionovič. \r\nO hodinu Stalin opäť volá Berijovi:\r\n”Už tú fajku nemusíte hľadať, Lavrentij Pavlovič, už som ju našiel. Bola v zásuvke môjho písacieho stola.”\r\n”Hm... to je čudné.” vraví Berija. ”Mne sa už 26 ľudí priznalo, že vám ju ukradli.”              ', 487, 3.4, 53),
	(11816, 'Otázka na rádio Jerevan:\r\nPrečo bol sovietsky systém nemorálny?\r\nLebo predával mlieko po korune.               ', 117, 3.5, 53),
	(11817, 'Rok 1950. Moskva. V obchode:\r\n”Klobásu máte?”\r\n”Máme.”\r\n”Aj údenú?”\r\n”Áno.”\r\n”A červený kaviár máte?”\r\n”Máme.”\r\n”Aj čierny?”\r\n”Áno.”\r\n”Vy si robíte zo mňa posmech!!!”\r\n”Vy ste si začali!!”              ', 258, 3.57, 53),
	(11818, 'Vo väzení na Kube sedia Jorge, Juan a Pablo. Jorge vraví:\r\n”Mňa zavreli preto, že som neskoro chodil do fabriky. Vraj som sa takto snažil znížiť produktivitu práce.”\r\n”Mňa zase za to,” hovorí Juan, ”že som do fabriky chodil skoro. To vraj dokazuje, že som kapitalistický špión.”\r\n”A mňa za to,” dodá Pablo, ”že som  chodil presne. Povedali, že tak som sa prezradil, že mám americké hodinky.”              ', 449, 4, 53),
	(11819, 'Otázka pre rádio Jerevan:\r\nNáš pes stále naháňa ľudí na bicykli. Čo máme urobiť?\r\nOdpoveď:\r\nZoberte mu bicykel.\n', 125, 4.03, 53),
	(11820, 'Naši dvaja bývalí spoluobčania, čo sa vysťahovali do Izraela, čítajú slovenské noviny. Ábeles sa pýta:\r\n”Očúvajú, Kohn, nevedia, čo je to tá slovenská daňová reforma?”\r\n”To sa pýtajú vy mňa, Ábeles?!!” hnevá sa Kohn. ”Vy, čo ste už tri razy skrachovali!!??”              ', 310, 3.4, 53),
	(11821, 'Ide had po púšti, stretne černocha a vraví mu:\r\n”Nezabíjaj ma, splním ti tri želania.”\r\n”Dobre,” vraví černoch, ”chcem byť biely, chcem, aby sa ženy na mňa lepili a chcem mať krídla.”\r\nHad na to:\r\n”Čáry máry hadia kožka, nech je z teba Always vložka.”              ', 300, 3.33, 53),
	(11822, '3 ľudia z troch štátov majú trafiť jablko na hlave človeka. Prvý ide američan, trafí a povie: I\'am Robin Hood. Druhý ide angličan, trafí a povie: I\'am Wiliam Tell.\r\nPosledný ide slovák, strelí a povie: I\'am sorry!              ', 242, 3.6, 53),
	(11823, 'Na kohútich zápasoch:\r\nAko zistíš, že je tam Francúz?\r\nPríde s kačicou.\r\nAko zistíš, že je tam Talian?\r\nVsadí na kačicu.\r\nA ako zistíš, že je tam mafia?\r\nKačica vyhrá.\n', 186, 3.73, 53),
	(11824, 'Stretnú sa Nemec, Američan a Pražák a hádajú sa, kto má ťažšiu reč.\r\nNemec: ”My píšeme nein a čítame najn.”\r\nAngličan: ”My zasa píšeme New York a čítame ako Ňu Jork.”\r\nPražák: ”Nemáte na nás, my píšeme Praha 3 a čítame Žižkov.”               ', 285, 4.13, 53),
	(11825, 'Američan, Francúz a Slovák sa chvália, aký má veľký zadok ich manželka. Američan hovorí:\r\n”Moja manželka má taký veľký zadok, že jej je posteľ malá.”\r\nFrancúz povie:\r\n”Moja manželka ho má taký veľký, že neprejde cez zárubňu najširších dverí.”\r\nA Slovák nato:\r\n”Moja manželka má modré oči.”\r\nTí dvaja prekvapene vravia:\r\n”A čo má byť?”\r\nSlovák odpovie:\r\n”No, to ostatné je zadok.”              ', 456, 4.17, 53),
	(11826, 'Cestujú turisti po Afrike a zrazu pri rieke vidia ako krokodíl žerie černocha. Trčí mu už len horná časť tela a jeden turista hovorí:\r\n- Aha, všade sa hovorí, akí sú v Afrike chudobní a  pozri, on sa tu váľa v spacáku od Lacoste!              ', 262, 3.85, 53),
	(11827, 'Otázka na rádio Jerevan:\r\n“Je pravda, že ak ruskí hokejisti nebudú majstri sveta v ľadovom hokeji, dostane každý Volgu?\r\nOdpoveď:\r\n“Áno, ale preplávať!”              ', 184, 3.29, 53),
	(11828, 'Do redakcie humoristického časopisu prišiel takýto list:\r\n“Sme pravidelnými čitateľmi vášho časopisu. Nechápeme však, prečo neustále uverejňujete anekdoty o šetrnosti Škótov. Uráža nás to. Ak nájdem vo vašom plátku ešte jeden takýto vtip, prisahám, že si váš časopis už nikdy nepožičiam!”              ', 340, 4, 53),
	(11829, 'Nápis v škótskom kníhkupectve:\r\nKupujte knihy už teraz, aby ste si ich mohli v kľude prečítať, než ich venujete ako darček na Vianoce.              ', 159, 4, 53),
	(11830, 'USA vyslalo troch špiónov do SSSR. Po čase sa vrátia a nastupujú rovno pred prezidenta USA.\r\n"Tak čo ste zistili?"\r\n"Nič, nedokázali sme sa votrieť medzi nich. \r\nPritom vraveli, že hovoríme ako oni, spievame ako oni, pijeme vodku ako oni, ale niečo sa im nezdalo."\r\n"Tak si myslím, či im nevadilo že ste černosi."\n', 330, 4, 53),
	(11831, 'Je to čierne a žerie to hranolky, čo je to?\r\nPolovica Spojených štátov.\n', 78, 3.91, 53),
	(11832, 'Postarší židovskí manželia spomínajú:\r\n- Pamätáš, Sára, ako nás vysťahovali z Ruska?\r\n- Áno, kam si šiel ty, tam aj ja.\r\n- A spomínaš, Sára, na varšavské gheto?\r\n- Samozrejme, vždy som bola s tebou.\r\n- A čo transport do Osvienčimu.\r\n- Všade som ťa verne nasledovala.\r\n- A pamätáš na tie ťažké začiatky po našej emigrácii do Izraela?\r\n- Kam si šiel ty, tam aj ja.\r\n- Keď tak o tom uvažujem, Sára, či ty mi neprinášaš smolu...\n', 467, 3.8, 53),
	(11833, '- Marusja,ľahni!\r\n- Uch, ty čort, kak ty mňa bystro ugavaril\n', 64, 3.13, 53),
	(11834, 'Do anglických novín prišiel nasledujúci list: \r\n"Ak okamžite neprestanete uverejňovať vtipy o Škótoch, už si vaše noviny nikdy nepožičiam!" \n', 154, 4, 53),
	(11835, 'Bavia sa Američan s Rusom o pomeroch u nich doma. Američan vraví: \r\n"To u nás je taká sloboda, že môžem kľudne počúrať prezidentovo auto." \r\nRus sa nenechá zahanbiť: \r\n"To u nás je taká sloboda, že sa môžem kľudne vysrať pri Kremli." Američan dodáva: \r\n"No, ono to tak dokonalé zase nie je - ja to potom musím utrieť." \r\n"Aby som pravdu povedal, u nás tiež nie. Ja si pritom nemôžem stiahnuť nohavice."              ', 447, 4.27, 53),
	(11836, 'Poradca prezidenta Spojených štátov zatelefonuje do Kremľu a pýta sa na výšku priemerného platu sovietského občana. Asi päť minút nikto neodpovedá, zo slúchadla je počuť len šramot a nezrozumiteľné šepkanie. Potom sa ozve zúfalý hlas: \r\n"A vy zase diskriminujete černochov!"              ', 312, 4, 53),
	(11837, 'V kupé širokorozchodného expresu v Rusku posrkávajú dvaja mierne spoločensky unavení báťuškovia. Po čase hodia reč: \r\n„Kuda vy idjotie?" \r\n„Z Moskvy v Petiersburg." odvetí druhý. \r\n„A vy?" \r\n„Z Petiersburgu do Moskvy." \r\nObaja chvíľu dumajú, čo sa deje, potom si opäť lognú a nadšene zvolajú: \r\n„Vot éto technika!"              ', 362, 4.21, 53),
	(11838, 'Škót prinesie deťom z jarmoku balón a slávnostne im ho odovzdáva: "Ale rozdeľte si ho spravodlivo!"              ', 120, 3.86, 53),
	(11839, 'Čo odmalička učia Eskymáci svoje deti?\r\nNikdy nepapaj žltý sneh.\n', 71, 3.87, 53),
	(11840, 'Škót sa pýta policajta:\r\n- To vy ste vytiahli môjho syna z vody?\r\n- Áno, - prisvedčí policajt trasúci sa od zimy.\r\n- A kde má čiapku?               ', 158, 3.8, 53),
	(11841, 'Súťažia Američania a Rusi, kto má rýchlejšie ponorky. Samozrejme, vyhrali pokrokoví Rusi. Neskôr sa kapitán americkej ponorky pýta kapitána ruskej: Prečo tá vaša ponorka pláva stále hore - dolu, hore - dolu... A Rus odpovedá: - To viete, tí naši veslári sa musia aj občas nadýchnuť.              ', 320, 4.09, 53),
	(11842, 'Škót stretol priateľa a držal si líce. - A prečo si to líce tak držíš? - Ále, bol som včera u zubára a vytrhol mi dva zuby. - No, ale však si sa sťažoval len na jeden. \r\n- Vieš, nemal mi vydať.              ', 225, 4.2, 53),
	(11843, 'Cestovatelia sa predierajú africkým pralesom. Z diaľky počujú dunenie bubnov. Keď prídu k osade, vidia čierneho muža,ako zúrivo bije do bubnov. \r\n"Čo sa deje?" pýta sa vedúci výpravy. \r\n"Nie je voda," odvetí bubeník. \r\n"Privolávate teda dážď?" \r\n"Nie, inštalatéra zo susednej osady..."              ', 321, 4.13, 53),
	(11844, 'Po čierno-čiernom lese kráča čierno-čierny človek, až dôjde na čierno-čiernu čistinku, na ktorej horí ohník a pri ňom sedí druhý, taký istý čierno-čierny človek. Ten prvý mu položí čierno-čiernu ruku na jeho čierno-čierne plece a hovorí: \r\n"Počúvaj, Vasja. Už by si mal prestať páliť tú gumu, zasral si celý les.              ', 364, 3.71, 53),
	(11845, 'Delegácia politikov sa bola v Izraeli pokloniť pri hrobe neznámeho vojaka. Tu jeden člen delegácie, ktorý trošku vedel hebrejsky, zistil, že je to hrob Izáka Ábelesa, predavača zeleniny. Tak sa teda spýtal sprievodcu, ako je to možné. Ten mu odpovedal, že pán Ábeles bol samozrejme známy ako predavač zeleniny, ale ako vojak bol úplne neznámy.              ', 378, 4, 53),
	(11846, 'Rusko. Hrob neznámeho vojaka. Strašná zima. Vojak, ktorý drží čestnú stráž, sa tiež celý klepe od zimy. Zrazu sa otvorí náhrobná doska na hrobe neznámeho vojaka, vylezie čudné indivídum a začne zbierať raždie a iný materiál, čo dobre horí. Ruský vojak ho chvíľu zmätene pozoruje a potom sa spýta:\r\n"Cholodno, cholodno?"\r\nIndivídum odpovie:\r\n"Was ist das cholodno?"              ', 410, 3.67, 53),
	(11847, 'V Amerike v Yellowstone poúča strážnik turistov: \r\n„Aby ste sa nestratili, dostanete každý na krk zvonček. A ešte niečo... ak zbadáte medvedie hovienko, radšej utekajte! \r\nTuristi na to:\r\n„A ako vyzerá medvedie hovienko? \r\n„Je to také obrovské, smradľavé a plné zvončekov..."              ', 313, 3.71, 53),
	(11848, 'Dvaja Kubánci preplávajú do USA, a keď vyjdú na breh, jeden hovorí druhému, že Američania jedia psov, a ak chcú zapadnúť, musia jesť psov aj oni. Tak idú ku stánku s nápisom Hot-Dog a vypýtajú si dva. Keď ich dostanú, jeden z nich rozbalí rohlík a začne zvracať. Keď skončí, spýta sa druhého: \r\n"A ty si dostal ktorú časť?"              ', 369, 4, 53),
	(11849, '\r\nEskimák sa vracia z poľovačky domov a pred domom zbadá mŕtveho medveďa. Pýta sa manželky: \r\n- Ako si ho zabila?\r\n- Bumerangom, čo visel na šnúre.\r\n- Ešte raz sa chytíš mojich ponožiek, tak ti polámem deku.              ', 237, 4.2, 53),
	(11850, 'Príde M. Tyson domov s rozbitým nosom a podliatinou pod okom. Žena sa ho pýta, čo sa mu stalo. \r\n- Ale, prepadli ma chuligáni a zobrali mi sto dolárov. \r\n- Teba, profesionálneho majstra sveta, zbili a okradli?\r\n- No prepáč! Nebudem snáď boxovať za sto dolárov.              ', 288, 4, 53),
	(11851, 'Sedí Škót McFarrin v zubárskom kresle a pýta sa lekára:\r\n- Pán doktor, trháte zuby aj bezbolestne?\r\n- Áno, za príplatok vás uspím.\r\nŠkót vytiahne peňaženku, ale lekár ho upozorňuje:\r\n- Platiť budete až potom.\r\n- Ja nechcem platiť. Chcem si len pred uspaním prepočítať peniaze.              ', 315, 3.67, 53),
	(11852, '\r\nRozpráva sa japonský a ruský magnetofón. Ruský sa pýta:\r\n"Ako sa máš?"\r\nJaponský na to:\r\n"Dobre. Pán mi kúpil novú kazetu!"\r\nRuský na to:\r\n"Heeej? Daj aj mne požuť!"              ', 196, 3.86, 53),
	(11853, 'V lietadle:\r\n- Pani letuška, nezdá sa vám, že letíme príliš nízko?\r\n- Ani nie, prečo?\r\n- Viete, pred chvíľou som zbadal za oknom chobotnicu.              ', 165, 3.9, 53),
	(11854, '\r\nPríde Indián na matriku:\r\n- Chcel by som si zmeniť meno.\r\n- A ako sa voláte?\r\n- Veľký-vlak-čo-dvakrát-zahúka-keď ide okolo.\r\n- A ako by ste sa chceli volať?\r\n- Tutút.              ', 194, 3.95, 53),
	(11855, 'Vojde banda kovbojov do salónu a jeden z nich položí na pult takého malého, desať centimetrového kovbojíčka. Ten začne objednávať rum pre každého. Odpije si, utrie ústa a hovorí:\r\n„Ej, to bola akcia, tú indiánsku dedinu sme zrovnali so zemou, všetko vypálili..."\r\nZasa objedná rum, odpije si a pokračuje:\r\n„Všetkých sme pozabíjali, to bola akcia..."\r\nOpäť si objedná rum a zrazu smutne prerečie:\r\n„Kua, ale s tým šamanom som si nemusel začínať..."              ', 501, 3.4, 53),
	(11856, 'Škót prišiel k psychiatrovi. Ten ho posadil na stoličku, zahľadel sa mu do očí a hovorí:\r\n- Opakujte: Som vyliečený, som vyliečený...\r\n- Som vyliečený, som vyliečený ... - opakuje s potešením Škót.\r\n- Výborne, povie doktor, - sedenie stojí desať libier.\r\nTu sa Škót pozrie hypnotizérovi hlboko do očí a povie:\r\n- Opakujte: Som vyplatený, som vyplatený...              ', 398, 4.19, 53),
	(11857, 'Škót cestuje s papagájom. Na colnici mu colník hovorí:\r\n- Clo sa neplatí iba pre vypchaté zvierata.\r\nŠkót rozmýšľa, papagáj sa naňho zadíva a zvrieskne:\r\n- Nerob hlúposti a zaplať!              ', 211, 3.63, 53),
	(11858, 'Na obchodnej schôdzke hovorí zástupca Iraku ruskému zástupcovi: \r\n”Vaše rakety typu zem - vzduch sa vynikajúco osvedčili. Teraz máme záujem o rakety typu zem - lietadlo.”              ', 198, 4.23, 53),
	(11859, 'Píše sa rok 1985. Dvaja chlapci idú po Červenom námestí a zrazu sa pred nimi otvorí kanál, z ktorého vystrčí hlavu starý vysušený dedko a pýta sa: \r\n”Chlapci, už sa skončila vojna?” \r\nChlapci si z neho vystrelia: \r\n”Nie, ešte nie.” \r\nDedo si smutne vzdychne: \r\n”Do prdele aj s tým Napoleonom.” a zalezie späť.              ', 356, 4.07, 53),
	(11860, 'Bol jeden Škót, čo sa každý deň po 30 rokov modlil, aby vyhral výhru v lotérii.\r\nPotom zahrmel z nebies hlas:\r\n"Synu, kúp si aspoň jeden los!"\n', 153, 4.2, 53),
	(11861, '"Čo by ste tomu povedali, pán Steigermark, dnes je deň zmierenia, keby sme si odpustili, čo sme si urobili, a žili naďalej v priateľstve? \r\nPozrite sa, ja vám želám zo srdca čo prajete vy mne..."\r\n"No prosím, Kohn, už zase začínate..."\n', 251, 3.9, 53),
	(11862, 'Stretne Kohn Franza a ten mu vraví:\r\n"Kde ty sa tu berieš?"\r\n"Ale, som tu na svadobnej ceste."\r\n"A kde máš Sáru?"\r\n"Niekto predsa musí zostať v obchode a predávať."\n', 174, 3.5, 53),
	(11863, 'Súdny proces v Grónsku:\r\n"Povedzte nám, kde ste bol v noci zo 14.októbra na 20.marca."\n', 91, 4.09, 53),
	(11864, 'Jedného dňa vojde doktor Watson do kancelárie Sherlocka Holmesa. "Dobré ráno, Watson, dnes ste si vzal vlnené spodky s pásikmi, nie je tak?"\r\n"Áno!" zvolal Watson, "ale povedzte mi ako ste dospel k tejto geniálnej dedukcii?"\r\n"Žiadna dedukcia, prosté pozorovanie, zabudol ste si obliecť nohavice."\n', 310, 4.12, 53),
	(11865, 'Poliaka prepadnú lupiči. Bráni sa ako lev, ale nakoniec ho aj tak\r\npremôžu. Prehľadali mu vrecká, ale našli len pár drobných:\r\n"To myslíš vážne, že si sa tak bil len kvôli desiatim zlotým?"\r\n"Nie, ja som myslel, že idete po tých päťdesiatich tisícoch, ktoré mám v topánke."\n', 299, 4, 53),
	(11866, 'V Škótsku proti sebe bojujú dva hrady. Z jedného vyletí delová guľa a na druhom odrazí kus hradieb. Z druhého hradu vyletí guľa a z prvého odrazí vežičku. \r\nTakto strieľajú týždeň, keď v tom zrazu ticho. Z jedného hradu sa vystrčí trubač:\r\n"Hej, prečo nestrieľate?"\r\nZ druhej strany sa ozve:\r\n"Nemôžeme, guľa je u vás!"\n', 351, 3.9, 53),
	(11867, 'Američan príde do Anglicka a na jednej turistickej prechádzke po Londýne zájde na trh. Pýta sa zeleninára na nejaký jeho tovar:\r\n"Hej, prosím vás, čo je toto?"\r\n"To sú zemiaky."\r\n"A viete, že my v Amerike pestujeme zemiaky desaťkrát väčšie, než tieto?"\r\n"Áno? My ich máme v Anglicku také, aby sa nám vošli do úst."\n', 340, 3.2, 53),
	(11868, 'Pri stretnutí roľníkov sa stretnú americký farmár a ruský kolchozník.\r\nAmeričan hovorí:\r\n"Keby si videl môj ranch a tie pastviny. Dva dni to obchádzam autom."\r\nKolchozník: "Keby si videl naše kolchozné lány, tie obchádzam týždeň."\r\nAmeričan mávne rukou a hovorí:\r\n"Tiež som mal také auto."\n', 315, 3.67, 53),
	(11869, 'Letia Havel a Clinton v lietadle, spadnú a zajmú ich ľudožrúti.\r\nNáčelník sa pýta Clintona:\r\n"Odkiaľ si?"\r\n"Z U.S.A."\r\n"Nepoznám, dajte ho na guláš!"\r\nĽudožrút sa otočí na Havla:\r\n"Ty so odkiaľ?"\r\n"Z Českej republiky."\r\n"To poznám! Dáš si guláš?"\n', 272, 3.93, 53),
	(11870, 'Príde minister k Mao Ce Tungovi:\r\n"Vodca, Slováci nám vyhlásili vojnu."\r\n"Slováci, a koľko ich je?"\r\n"Asi 5 miliónov."\r\n"A v ktorom hoteli bývajú?"\n', 157, 4.05, 53),
	(11871, 'Nad Sibírou prelietava lietadlo.\r\n"Čo sú to za drevené domy tam dole?" pýta sa cestujúci.\r\n"Pioniersky tábor!" \r\n"Fakt? A koľko má rokov ten zarastený chlapček?"\r\n"Desať."\r\n"A ten s tými fúzmi po pás?"\r\n"Dvadsať."\r\n"A ten s tými fúzmi až po zem?"\r\n"Tak ten to má doživotne!"\n', 296, 4, 53),
	(11872, 'Vedci za totality vykopú kostry Cyrila a Metoda. Ale teraz nevedia, ktorý je ktorý. Pošlú teda kostry špecialistom do Moskvy. \r\nZa mesiac prídu dve malé krabice, obe kostry rozmrvené na prášok. V jednej krabici je malá cedulka:\r\n"To je Cyril - priznal sa."\n', 269, 4, 53),
	(11873, 'Gorbačov pokladá na hrob neznámeho vojaka vence a ozve sa hrozná rana. Rana bola tak veľká, že to prebudilo i neznámeho vojaka, ktorý práve stáva z rakvy. Gorbačov nevie, čo má povedať a tak prehodí:\r\n"To bola šleha, čo?" \r\nA vojak odvetí:\r\n"Was ist das \'Šleha\'?"\n', 284, 4.09, 53),
	(11874, 'Viete, na čo zomrel Stalin?\r\nNa skrat... zrástlo mu obočie.\n', 63, 3.71, 53),
	(11875, 'Pred Bielym domom je demonštrácia. Všetci kričia:\r\n"Dajte nám prácu, dajte nám prácu!"\r\nNa balkón vyjde jeden z kongresmanov, ukáže na jedného z demonštrantov a povie:\r\n"Poď sem, ja ti dám prácu."\r\n"Prečo akurát mne, prečo nie niekomu inému??"\n', 264, 4, 53),
	(11876, 'Človek sa plazí po púšti z posledných síl a zrazu vidí studňu. Zakričí:\r\n"Vooodaaa!!!"\r\nZo studne sa ozve:"\r\n"Kdeee???"\n', 130, 3.6, 53),
	(11877, 'Dozorca na galére kričí na galejníkov:\r\n"Mám pre vás dve správy - dobrú a zlú. Ktorú chcete počuť skôr?"\r\n"Tu dobrú!!!"\r\n"Večer v prístave každý dostane poriadnu večeru a víno!"\r\n"No to je skvelé! A tá zlá?"\r\n"Cestou do prístavu sa kapitán sa chce trochu prejsť na vodných lyžiach!"\n', 311, 3.78, 53),
	(11878, 'Turisti obdivujú prekrásnu panorámu Kordiller. Sprievodca hovorí:\r\nJe to najzdravší kraj v celej Južnej Amerike."\r\n"Je tu tak zdravo, že tu vlastne ani nikto neumiera."\r\n"No a čo ten včerajší pohreb?" pýta sa jeden turista.\r\n"To umrel od hladu majiteľ pohrebného ústavu."\n', 288, 3.14, 53),
	(11879, 'Arabský šejk pošle študovať svojho syna do USA. Po týždni príde z Ameriky list:\r\n"Milý ocko, je tu pekne, ale všetci chodia do školy autobusom, len ja autom. Urob s tým, prosím ťa, niečo."\r\nV odpovedi došlo:\r\n"Milý synku, v liste je priložený šek na 100.000$ a kúp si aj ty autobus."\n', 305, 3.5, 53),
	(11880, 'Prišli ste na kohútie zápasy. Ako spoznáte, že je tam Poliak?\r\nTo je ten s kačkou.\r\nA ako spoznáte, že je tam nejaký Talian?\r\nJe to ten, čo stavil na tú kačku.\r\nA ako spoznáte, že je tam mafia?\r\nKačka vyhrá.\n', 224, 3.86, 53),
	(11881, 'Ako sa volá štvorhrbá ťava v Saudskej Arábii? \r\nSaudi Quattro.                                                                                            ', 159, 3.9, 53),
	(11882, 'V sovietskom mäsiarstve:\r\n- Požalsta, nakrajate mi dvadsať deko šunky?\r\n- Jasne! \r\n- Prinesite, nakrajame!              ', 124, 3.2, 53),
	(11883, 'Zo sovietskej éry:\r\nPrečo v Rusku zakázali túto jar hlbokú orbu?\r\nAby nepoškodili byty druhej kategórie.\n', 112, 3.71, 53),
	(11884, 'Prečo si austrálsky aborigini neradi vyrábajú nový bumerang?\r\nLebo potom nevedia zahodiť ten starý.              ', 120, 3.71, 53),
	(11885, 'Kedy indiáni skonštatujú, že vyschlo koryto rieky?\r\nKeď sa im práši za kanoe.              ', 98, 3.18, 53),
	(11886, '"Ty, boli sme v Egypte na dovolenke. A vieš, akú tam mali najväčšiu pamatihodnosť?" \r\n"To je jasné, pyramídy..." \r\n"Nie. Náš autobus!"              ', 158, 3.75, 53),
	(11887, 'Telefonuje inžinier Igor z Moskvy inžinierovi Jurijovi na Sibír.\r\n- Jurij, v rádiu hlásili, že u Vás je mínus 60 stupňov. Je to pravda?\r\n- Nie tu je iba tridsať pod nulou.\r\n- Ale predsa by si v rádiu nevymýšľali.\r\n- No, možno vonku...              ', 263, 4, 53),
	(11888, 'Starký vykladá zvedavému turistovi:\r\n- Toto je najzdravšia dedina na svete! Je tu tak zdravý vzduch, že u nás nikto nemarodí ani neumiera...\r\n- To nie je pravda. - skočí mu do reči turista. - Včera tu boli dva pohreby.\r\n- To bol lekár a hrobár, umreli od hladu.\n', 276, 3.17, 53),
	(11889, 'Príde Usáma bin Ládin domov a pýta sa manželky:\r\n- Nehľadal ma niekto?              ', 90, 2.5, 53),
	(11890, 'Rok 1923. Zväz sovietskych socialistických republík. Kremeľ. XII. zjazd Komunistickej strany Ruska.\r\nJeden z delegátov nadšene žiada:\r\n- Učiť sa! Učiť sa! Učiť sa! Tak, ako nám to odkázal veľký vodca svetového proletariátu Vladimír Iľjič Lenin! Za predsedníckym stolom na tribúne sedí aj Lenin a zlostne si pre seba zašomre:\r\n- Nič som neodkázal! Iba som si rozpisoval pero!              ', 416, 3.64, 53),
	(11891, 'Telefonuje Jimmy Sergejovi, s ktorým sa spoznal na mezinárodnej konferencií:\r\n- Ahoj, vraj je teraz u vás mínus 54 stupňov Celzia?\r\n- Nezmysel, sotva mínus 15!!!\r\n- Ale na CNN to hlásili a ukazovali aj teplomer ...\r\n- Ahá, tak možno vonku ...\n', 253, 4.11, 53),
	(11892, 'Známeho afrického bádateľa navštívili priatelia v jeho bungalove a rozprával im o sexuálnom živote tamojších goríl:\r\n"Taký samec gorily, aby privábil partnerku, vydáva zo seba príšerné zvuky." A začne vydávať strašné škreky. Hneď na to sa vo dverách objaví bádateľova manželka a svojmu mužovi pohoršene dohovára:\r\n"Ale, Alfréd, máš rozum, teraz doobeda?”\n', 393, 4.21, 53),
	(11893, 'Vietnamská vojna. Na hranici beží vojak s bielou zástavou a kričí:\r\n- Mier! Mier!\r\nA na druhej strane ostreľovač frfle:\r\n- Veď mierim, len sa toľko nehýb!              ', 179, 4.09, 53),
	(11894, 'Ide muž po džungli a stretne tlupu domorodcov. Hovorí si:\r\n"Tak a teraz som v keli."\r\nVtom sa z neba ozve hlas:\r\n"Zober ten kameň vedľa teba a hoď ho do náčelníka!"\r\nMuž neváha, schytí kameň, hodí ho do náčelníka a zabije ho. A z neba sa ozve:\r\n"Tak teraz si už fakt v keli!"		              ', 309, 4.19, 53),
	(11895, 'Na Sibíri, v strašnej zime, hovorí babka vnúčikovi:\r\n- Iváňuška, zabila som kura na obed.\r\n- A čím si ho zabila, bábuška?\r\n- Ale, na peci som našla nejaký bumerang.\r\n- Bábuška, ešte raz sa dotkneš mojej ponožky, tak ti zlomím deku!              ', 265, 4.08, 53),
	(11896, 'V Afganistane idú v aute dvaja Talibovia. Jeden vraví druhému:\r\n- Vieš čo, vyhoď ma pred americkým veľvyslanectvom.              ', 137, 3.57, 53),
	(11897, 'Kovboj nastúpi do autobusu, vytiahne pištoľ a hovorí:\r\n"Džim nikdy neplatí."\r\nTak sa to opakuje, až nakoniec šofér zavolá šerifa, a ten sa skryje v autobuse. Príde kovboj, vytasí kolt so svojim: "Džim nikdy neplatí" a šerif vyskočí:\r\n"Prečo Džim nikdy neplatí?"\r\n"Pretože Džim má mesačník," hovorí kovboj.               ', 347, 4.07, 53),
	(11898, 'Rus a Eskimák sa vyberú poľovať na medveďa. Idú tri hodiny a zrazu sa objaví medveď. Rus vezme pušku, namieri, už už chce vystreliť a vtom Eskimák vraví:\r\n“Nestrieľaj! Utekajme!“\r\nTak bežia, bežia už dobré dve hodiny. Zrazu sa Eskimák otočí a medveďa zastrelí.\r\n“Prečo som ho nemohol zastreliť už predtým?“ čuduje sa Rus.\r\n“Museli by sme ho ďaleko ťahať.“ vysvetľuje Eskimák.\n', 422, 3.5, 53),
	(11899, 'Slovák vysvetľuje Američanovi, čo znamenajú farby na našej vlajke:\r\n“Naša vlajka predstavuje naše dane. Keď o nich hovoríme, tak sa červenáme. Keď nám daňoví úradníci napíšu, že máme nedoplatky, tak zbledneme, a keď ich zaplatíme tak zmodráme.“\r\n“U nás je to to isté,“ vraví Američan, “akurát my pritom ešte vidíme hviezdičky.“\n', 373, 3.67, 53),
	(11900, 'K embéčke stojacej na Broadwayi podíde Američan, zvedavo si auto prezerá a vraví si:\r\n"Hm, pekné, skutočne pekné."\r\nPotom sa otočí k majiteľovi a pýta sa:\r\n"To ste si postavili sami, alebo vám niekto pomáhal?"              ', 238, 3.8, 53),
	(11901, 'Dvaja ruskí inžinieri plnia raketoplán palivom. Jeden z nich hovorí:\r\n"Počúvaj, to palivo smrdí ako vodka."\r\nDruhý trochu odleje, ochutná a vraví:\r\n"To palivo chutí ako vodka."\r\nTak obaja vypijú polovicu nádrže. Na druhý deň ráno jeden telefonuje druhému:\r\n"Sergej, už si prdol?"\r\n"Ešte nie, prečo?"\r\n"Tak to ani nerob, lebo ja volám z Tokia!"              ', 379, 4.26, 53),
	(11902, 'Mladý Donald MacDonald zo Škótska šiel študovať na univerzitu v Oxforde. Mama sa ho po prvom mesiaci pobytu na internáte pýta v telefóne: \r\n"Tak čo, ako sa  máš? Čo škola? Čo intrák?" \r\n"Škola je v pohode, ale internát moc nie. Tí Angličania sú hrozne hluční ľudia. Na izbe vľavo odo mňa stále niekto mláti hlavou o stenu, napravo zase niekto celú noc reve a jačí." \r\n"Chudáčik... A ako to zvládaš s tými hlučnými Angličanmi?" \r\n"V pohode. Nič si z toho nerobím. Len tak ticho stojím v izbe a hrám si na gajdy..."              ', 570, 4.06, 53),
	(11903, 'Bolo nebolo, Apollo pristálo na Mesiaci a astronauti celí rozčúlení vysielajú na Zem: \r\n"Hjustn, Hjustn, Rusi pristávajú na Mesiaci. Čo máme robiť?" \r\n"To nie je možné. Pokračujte normálne v programe." \r\nĎalší deň: \r\n"Hjustn, Hjustn, Rusi pristáli a hneď začali natierať Mesiac na červeno. Čo máme robiť?" \r\n"Kľud, chlapci. Vezmite si tabletku na ukľudnenie, to bude halucinácia." \r\nPo pár dňoch začína Mesiac červenať: \r\n"Hjustn, Hjustn, skoro celý Mesiac už natreli načerveno. Čo máme robiť?" \r\n"Žiadnu paniku, všetci naši špecialisti pracujú na riešení. Počkajte." \r\nA ďalší deň: \r\n"Hjustn, Hjustn, to je koniec! Celý Mesiac je už červený!" \r\n"Naša chvíľa prišla, chlapci. Otvorte box 43Bx. Vo vnútri nájdete štetec a vápno. A píšte: "Coca-Cola..."              ', 833, 4.23, 53),
	(11904, 'V lietadle sedí Slovák, Rus, Američan a Brit. Náhle sa im vznieti motor a majú len tri padáky. Prvého padáku sa chytí Rus a so slovami "Ako príslušník najinteligentnejšieho národa mám právo sa zachrániť" vyskočí. Druhý padák pre seba urve Američan. Prehlási: "Ako príslušník najbohatšieho národa mám právo na život" a tiež vyskočí. Brit s kľudom Angličana prenesie smerom k Slovákovi "Mal by som síce právo vyskočiť, ale ako gentleman vám prenechám zostávajúci padák." Slovák sa samozrejme nenechá vyviesť\r\nz miery a prehlási: "Môžeme kľudne skočiť obaja, pretože príslušník najinteligentnejšieho národa vyskočil s mojím vakom."              ', 706, 3.84, 53),
	(11905, 'Číňan príde do baru a na hlave má mrkvu. Barman sa pýta: \r\n"Kde ste to, prosímvás, zohnali?" \r\nA mrkva odpovedá: \r\n"V Číne, je ich tam plno."\n', 153, 3.43, 53),
	(11906, 'Z dôb nie zas tak dávnych sa traduje historka o bohatom Američanovi, ktorý si hrozne prial, aby mu syn z návštevy Moskvy priniesol myší olej. Vraj je to musí byť niečo úžasné, keď na to ľudia dokážu stáť v ukrutnom ruskom mraze niekoľkohodinové fronty. Keď sa syn zo zájazdu vrátil, musel však starého Sama sklamať.\r\n„Vieš, oci, tak som išiel na to námestie, kde si ma poslal," hovorí syn po návrate. „Fronta tam bola naozaj strašná a keď som sa dostal až k tomu stánku, ktorý je v sprievodcovi označený ako MAUS OLEUM, ležal tam len mŕtvy pumpár..."\n', 599, 2.92, 53),
	(11907, 'Na turistu, prechádzajúceho sa po malebných uličkách Belfastu, vyskočilo podozrivé indivíduum s otázkou: \r\n„Hej, frajer, si katolík alebo protestant?“ \r\nTuristovi je v tej chvíli jasné, že keď povie katolík a indivíduum je protestant, tak ho odpráskne. To isté mu hrozí, ak povie protestant a indivíduum\r\nje katolík. Nakoniec ho osvieti spásna idea a tak odpovie: \r\n„Ani jedno, ani druhé. Ja som totiž Žid.“ \r\nPo týchto slovách indivíduum odistí búchačku a radostne prehlási: \r\n„Tak to som ja ten najšťastnejší Arab v celom Írsku!“              ', 594, 4.25, 53),
	(11908, 'Slogan ukrajinskej cestovnej kancelárie:\r\n”Príďte, navštívte našu krásnu krajinu, veď Vaše auto je už tu.”              ', 134, 4, 53),
	(11909, 'Americký pluk osobitného určenia Morskí kocúry sa pripravuje na expedíciu do Afganistanu. Vyhlásia poplach. Za niekoľko minút sa všetci zhromaždili v plnej zbroji, len vojak Johnson chýba. Príde po dobrej polhodine. Seržant reve: \r\n- Johnson, všetci naši chlapci sú už pripravení natrhnúť prdel tým talibom a ty ideš neskoro!!!\r\n- Viete, seržant, - ospravedlňuje sa Johnson, - dostal som signál poplachu keď som bol v posteli. Vyskočil som a rýchlo som si obliekol maskáče. Nasadil prilbu. Nafarbil som si tvár kamuflážnymi farbami. Opásal som sa remeňom. Na remeň som si pripevnil granáty. Vľavo som si zavesil tesák a vpravo pištoľ. Navliekol som si nepriestrelnú vestu. Nasadil som si ochranné okuliare. Do vreciek vesty som si napchal rezervné zásobníky nábojov. Na chrbát som si zavesil ruksak plný mín. Do topánok som zasunul fínsky nôž. Na pravé plece som si zavesil Stinger a na ľavé bazuku. Zobral som do zubov dýku. Do pravej ruky som zobral M-16 a do ľavej ľahký guľomet. Už som sa zberal odísť, no vtom som sa náhodou zazrel v zrkadle... Poviem vám, tak som sa zľakol, že som sa trochu  posral...               ', 1193, 3.92, 53),
	(11910, 'Na Sibíri na brehu mora sedí chlapík a chytá ryby. Zrazu sa z hlbín mora vynorí americká ponorka, otvorí sa kryt a vystrčí sa nejaký vojak. Chvíľu sa pozerá dokola ďalekohľadom a potom zakričí dole: \r\n“Smer severo - severovýchod!” zalezie, zabuchne kryt a ponorka zmizne v mori. Chlapík sa chvíľu pozerá, ale ďalej sa venuje rybárčeniu. Pár minút na to, sa z mora vynorí ruská ponorka, vytrčí sa vojačisko a keď zbadá rybára, zakričí naňho: \r\n“Hej, ty tam! Nebola tu náhodou pred chvíľou americká ponorka?” \r\nRybár kričí, že hej. \r\nVojak: “A ktorým smerom odplávali?”\r\nRybár: “Smer severo - severovýchod!”\r\nVojak: “No, no, no! Nemachruj a ukáž rukou!”              ', 738, 4.08, 53),
	(11911, 'Hitler dostane opušťák z pekla. Po dvoch dňoch sa vráti a hovorí:\r\n"Je to tam hrozné. Celý svet je naruby – Nemci kšeftujú a Židia vedú vojny."\n', 158, 4.15, 53),
	(11912, 'Raz stretla Jane Tarzana. Tarzan bol celkom štramák - určite ste ho videli v televízii (taký nadupaný svalnáč) - a Jane sa strašne zapáčil. Trochu sa s ním porozprávala, ako ide život, ako poslúchajú opice a tak, a potom sa ho opatrne spýtala:\r\n- Tarzan, a čo sex?\r\n- Sex? Čo je to?\r\nJane mu to slušnými slovami vysvetlila a Tarzan pochopil.\r\n- Ahááá, jasne. No na to používam dieru v strome.\r\n- Ale Tarzan, na to ideš úplne zle. Musím ti ukázať ako sa to robí. Uvidíš, že to bude lepšie, ako ten tvoj strom.\r\nVyzliekla si šaty a ľahla si na zem. Tarzan si odložil kus kože, čo nosil okolo bedier, pristúpil bližšie a potom celou silou kopol Jane do rozkroku. Jane sa skrútila od bolesti:\r\n- Čo to robíš, hlupák?!\r\n- Kontrolujem, či nemáš včely.\n', 799, 4.02, 53),
	(11913, 'Rus, Angličan a Francúz sa rozprávajú o tom, čo je najväčšia slasť. Angličan hovorí:\r\n- Najväčšia slasť je len tak sa posadiť v klube do koženého kresla, dať si trochu whisky so sódou a čítať si nový Times.\r\nFrancúz vraví:\r\n- Kdeže, najväčšia slasť je mladá ohnivá milenka a staré víno.\r\nRus na to:\r\n- Vy o tom nič neviete. Pravá slasť je, keď večer pozerám televízor, niekto zazvoní, ja idem otvoriť. Tam stoja dvaja páni v klobúkoch a dlhých kabátoch a pýtajú sa: “Voloďa Sergejevič?“ A ja môžem povedať: “O poschodie vyššie!“.\n', 595, 4.11, 53),
	(11914, 'Jožo, Paľo a Maroš sa stratili v džungli a natrafili na ľudožrútov. Kráľ ľudožrútov ich uväznil a povedal im, že by mohli žiť ak prejdú skúškou, ktorá pozostáva z troch úloh. Prvou úlohou je ísť do lesa a nazbierať desať kusov rovnakého druhu ovocia. Tak všetci traja išli rôznymi smermi trhať plody. Paľo sa vrátil a vraví kráľovi:\r\n- Ja som doniesol desať jabĺk.\r\nKráľ mu hovorí:\r\n- Druhou úlohou je strčiť si ich všetky do zadku bez toho, aby si prejavil akékoľvek pocity zvukom alebo výrazom tváre. Ináč budeš zjedený.\r\nPrvé jablko vošlo, ale pri druhom sa už Paľovi objavil v tvári výraz ukrutnej bolesti, tak ho zjedli. Maroš sa vrátil s desiatimi čučoriedkami. Kráľ aj jemu vysvetlil druhú úlohu a Maroš si pomyslel, že to bude jednoduché. 1... 2... 3... 4... 5... 6... 7... 8... keď už bol pri deviatej čučoriedke, vybuchol od smiechu, a tak bol tiež zabitý. Následne sa obaja zabití stretnú v nebi a Paľo sa pýta Maroša:\r\n- Prečo si sa začal tak strašne smiať? Veď si už bol tak blízko...\r\nMaroš odpovedá:\r\n- Nemohol som si pomôcť, keď som videl prichádzať Joža s desiatimi ananásmi.\n', 1192, 4.15, 53),
	(11915, 'Angličan, Austrálčan a Juhoafričan sú spolu v jednom bare v Londýne a pijú pivo. Juhoafričan dopije, vyhodí pohár do vzduchu, vyberie pištoľ, strelí a pohár sa rozsype na malé kúsky. Juhoafričan vraví:\r\n- My, v Južnej Afrike, máme také lacné poháre, že nepotrebujeme piť z jedného dvakrát.\r\nAustrálčan je zmätený, tak tiež urobí to isté a hovorí:\r\n- My, v Austrálii, máme toľko piesku na výrobu pohárov, že nepotrebujeme piť z jedného dvakrát.\r\nAngličan ostáva chladný. Vypije pivo, vyhodí pohár do vzduchu, vyberie zbraň, zastrelí Juhoafričana a Austrálčana a hovorí:\r\n- My, v Anglicku, máme toľko Juhoafričanov a Austrálčanov, že nepotrebujeme piť s tými istými dvakrát.\n', 738, 4.04, 53),
	(11916, 'Na čínsku hranicu príde ruský bohatier:\r\n"Ej, sto tisíc číňanov, poďte za kopec, bojovať so mnou!"\r\nSto tisíc číňanov išlo za kopec, po hodine výjde spoza kopca ruský bohatier a zase kričí:\r\n"Heej! Sto tisíc číňanov, poďte so mnou bojovať!"\r\nA zase ide sto tisíc číňanov za kopec a po hodine zase výjde bohatier:\r\n"Ďalších sto tisíc číňanov, poďte so mnou bojovať!"\r\nAle spoza kopca sa plazí jeden neporiadne dobitý číňan a z  posledných síl kričí na svojich:\r\n"Chlapi! Nechoďte tam! Je to pacsa! Sú dvaja!"\n', 558, 4.17, 53),
	(11917, 'Vyjde muž o pol noci na balkón bytovky a kricí:Ľudiaaaaaaaaaaaaaaaaaaaaaa! Ľudiaaaaaaaaaaaaaaaaaaaaaaaaaaa! a preľaknutí ľudia povychádzajú z bytov a on kričí ďalej: Ľudiaaaaaaaaaaaaaaaaaaaa! Čo nespíte!', 219, 3.55, 53),
	(11918, 'Jeden tlstý človek chcel schudnúť, kúpil si knihu na chudnutie. Bolo tam napísane: Pondelok-nejesť. Utorok-nejesť. Streda-nejesť. Štvrtok-nejesť. Piatok-nejesť. Sobota-nejesť. Nedeľa-vysrať sa. Pekne tuto diétu dodržiaval, až v Nedeľu išiel do lesa, kde ho to chytilo. Stiahol, gate a začal tlačiť. Odrazu počuje:mňam mňam mňam...Myslel že sa niekto na neho pozerá zdvihol gate a išiel hlbšie do lesa. Znova stiahol gate a zas počuje:mňam mňam mňam mňam... Ohne hlavu a pozrá sa pod seba a čo nevidí? Riť mu žrala trávu!\r\n', 564, 3.8, 53),
	(11919, 'Je to hnedé a parí sa z toho? Čo to je?\r\nSpotené veverička. ', 65, 3.09, 53),
	(11920, 'Slovenský turista obeduje v reštaurácii v New Yorku, príde k nemu čašník a spýta sa ho: "Are you finish?" On zdvorilo odpovedá: "NO, I\'m slovakish."', 157, 3.5, 53),
	(11921, 'Syn dáva mame hádanku:\r\nSyn: Mami, dá sa jedna dierka zapchať dvoma?\r\nMama: Nie.\r\nSyn: Dá.\r\nMama: Ako?\r\nSyn: Keď strčíš niekomu nos do zadku.', 150, 3.7, 53),
	(11922, 'Stretnú sa 2 kostry na ceste a jedna sa pýta druhej: "Kde si bola?" Druhá jej odpovedá: "Ále, u kožného."', 112, 3.78, 53),
	(11923, 'Maroš Fero a Dežo sú v džugli. Nájdu ich tam domorodci a povedia im, že musia prejsť testom, ktorý ma 3 časti. Ak ním neprejdú, tak ich zabijú. Prvá časť spočíva v tom, že majú ísť do džungle a nájsť tam 10-krát to isté ovocie a vrátiť sa späť.\r\nPrvý príde Maroš, má 10 jabĺk. Vysvetlia mu, že v druhej časti, si musí ovocie napchať do zadku a nemá pri tom pocítiť žiadnu bolesť. Maroš sa pri druhom jablku zašklebil, a tak ho zabili. Druhý došiel Fero, ktorý mal 10 čučoriedok. Vysvetlili mu druhú časť. Pomyslel si, že to bude ľahké a začal si dávať čučoriedky do zadku, 1,2,3,4,5,6,7,8,9 bolo v zadku, ale začal sa smiať, a tak ho tiež zabili. V nebi sa stretne s Marošom, ktorý sa ho pýta: "Počuj Fero, prečo si sa začal smiať, keď si bol už tak blízko:"."Nemohol som si pomôcť, keď som videl ako ide Dežo s 10-timi ananásmi."', 910, 3.68, 53),
	(11924, 'V jednom luxusnom hoteli konzumuje Francúz croasant s džemom, keďk nemu príde  Američan a žuje žuvačku. Hovorí mu: "Recyklujete clieb?". Francúz sa ho opýta: "Nie prečo?". Američan odpovie: " No, lebo my ho zjeme a kôrku oblížeme a recyklujeme na croasanty. A recyklujete ovocie?"."A mali by sme?" - opýta sa Francúz. Američan na to: "My ovocie zjeme, no šupku oblížeme a recyklujeme na džem." Francúza to naštve a povie: "A recyklujete kondómy?".Američana to prekvapí, a tak Francúz vysvetľuje: "Lebo my ich použijeme, bolížeme a recyklujeme na žuvačky, ktoré posielame do Ameriky!!!"  ', 623, 3.94, 53),
	(11925, 'Ide ocko, maminka a ich synček v lietadle na dovolenku a synček vraví: "Ocko, mne sa chce cikať." "Choď na pravé krídlo." Maminka ho vidí a pýta sa ho: "Synček, čo robíš?" "Polievam kvietky." Let pokračuje ďalej, keď synček naraz príde za maminkou a vraví jej: "Mne sa chce kakať." "Choď na ľavé krídlo." Ocko sa ho pýta: "Synček, čo robkáš?" "Bombardujem Rusov."', 392, 3.18, 53),
	(11926, 'Ide vysmädnutý chlapík po púšti a zbadá studňu:\r\n- Voda!!!\r\nZo studne sa ozve:\r\n- Kde???', 95, 4.04, 53),
	(11927, 'Príde Angličan do Juhoafrickej republiky a rozhodne sa, že by rád do kina. Príde k okienku, vypýta si lístky a pani za okienkom sa začne strašne smiať a hovorí: "Vy nie ste odtiaľto, že nie?"\r\n"Nie! Ako to viete?"\r\n"U nás bieli idú do kina zadarmo."\r\n"Aha..."\r\nTak ide ďalej a pýta sa, kam sa smie usadiť. Tá sa rovnako pýta:\r\n"Vy nie ste odtiaľto, že nie?"\r\nAngličan: "Nie, no ako to viete?"\r\n"U nás bieli idú rovno na balkón a čierni sedia dole."\r\n"Aha..."\r\nTak si sadne a v strede filmu mu strašne treba na záchod... Vyjde von a pýta sa:\r\n"Prosim Vás, kde sa tu môžem vycikať?"\r\nPani sa na neho pozrie a hovorí:\r\n"Vy nie ste odtiaľto, že nie?"\r\nAngličan: "Nie! No ako to viete?"\r\n"U nás bieli rovno na tých čiernych, aby im kus filmu neušiel."\r\n"Aha..."\r\nTak Angličan chce zachovať tradíciu, postaví sa a začne v strede filmu čúrať. Naraz sa postaví zdola černoch a kričí: "Do riti! Ty nie si odtiaľto, že nie?\r\nAngličan:\r\n"Nie! No ako to viete?"\r\n"...Tak, čúram aspoň CIK-CAK a nie furt na mňa!"', 1060, 4.23, 53),
	(11928, 'Stupne zimy\r\n+18°C Obyvatelia Havaja si na noc berú dve prikrývky\r\n+10°C Obyvatelia helsinských činžiakov vypínajú topenie\r\nRusi pestujú kvietky\r\n+ 2°C Talianské autá sa nedajú naštartovat\r\n0°C Destilovaná voda zamŕza\r\n-1°C Dych sa stáva viditeľným. Rusi jedia zmrzlinu a popíjajú studené pivo\r\n-4°C Pes sa ti snaží napchať do postele\r\n-10°C Francúzske autá prestávajú štartovať\r\n-12°C Politici začínajú rozprávať o bezdomovcoch\r\n-15°C Americké autá sa nedajú naštartovať\r\n-18°C Helsinský obyvatelia zapínajú topenie.. Obyvatelia Havaja zamrzli\r\n-20°C Dych sa stáva počuteľným\r\n-24°C Nemecké autá sa nedajú naštartovať\r\n-29°C Pes sa ti pokúša vliezť pod pyžamo. Japonské autá sa nedajú naštartoavť\r\n-30°C Žiadne normálne, ani ruské autá neštartujú\r\n-39°C Vriaca atmosféra v Kongrese zamrzne. Rusi si zapínajú horný gombík na košeli\r\n-50°C Auto sa ti snaží napchať do postele\r\n-60°C Obyvatelia Helsínk zamrzli. Tulene opúšťajú Grónsko a sťahujú sa na juh\r\n-70°C Zamrzlo peklo. Univerzita v Kuznecku organizuje cezpoľný beh na zahriatie\r\n-72°C Advokáti si strkajú ruky do vlastných vreciek\r\n-75°C Santa opúšťa polárny kruh\r\n-120°C Alkohol zamrzol, Rus je poriadne nasratý\r\n-268°C Hélium zkvapalnelo\r\n-273,15°C Absolútna nula. Elementárne častice sa prestávajú hýbať. Rus líže zmrznutú vodku a uznáva, že je ozaj kosa', 1443, 4.2, 53),
	(11929, 'Katechetka sa pýta v škole detí:\r\n- Deti, viete kde býva Ježiš Kristus?\r\nJanka povie:\r\n- V kostole.\r\nPeťko sa hlási a povie:\r\n- V našom srdci.\r\nMóric sa hlási a povie:\r\n- Býva u nás na záchode.\r\nKatechetka sa začuduje a spýta sa, že ako je to možné.\r\nMóric hovorí:\r\n- No, vždy keď idem ráno na záchod, tak ocino mi začne vybuchávať na dvere a hovorí mi "Ježiši, dokedy tam ešte budeš!"', 418, 3.85, 53),
	(11930, 'Viete prečo brunetka nosí miesto gatiek slipy?Lebo si mysli že je gay. ', 74, 2.6, 53),
	(11931, 'Pošlite jedlo STOP Lajku som už zjedol STOP Gagarin STOP', 58, 3.05, 53),
	(11932, 'Chuck Norris rozplače cibuľu.', 31, 3.5, 53),
	(11933, 'Aký je rozdiel medzi slovenským a kanadským drevorubačom???Nijaký. Obaja si za týždeň zarobia na cestu do Bratislavy. ', 126, 3.8, 53),
	(11934, 'Ide trpaslík do sveta, príde do Poľska a policajt sa ho pýta: "Kam ideš?"Trpaslík: "Ja som malý trpaslíček, mám svoj kyblíček".Policajt: "Pakuj sa odtiaľto, ty nespratník"!V Amerike sa zopakuje to isté, a tak príde na Slovensko, kde sa stále kradne. Policajt na hranici sa ho pýta: "Čo tu robíš?"Trpaslík: "Ja som malý trpaslíček, dokelu kde mám svoj kyblíček."   ', 392, 3.26, 53),
	(11935, 'Ide rušňovodič v ponorke po púšti a stretne žabu, ako kosí džem. Rušňovodič sa jej pýta: "Žaba, koľko je hodín?"\r\nŽaba vytiahne teplomer a hovorí: "Ďakujem, nefajčím!" ', 188, 2.97, 53),
	(11936, 'Američan volá svojmu ruskému kamarátovi: „Hej Ivan, je to pravda? V Moskve je vraj -60 stupňov!“\r\n“Ale ba, -20.“\r\nPo chvíli znova: „Je to vo všetkých správach, -70 !“\r\n „ Ale nie, -30.“\r\n „Ale vraj zamrzla všetka voda v širokom okolí! Boli tu aj zábery v televízie!“\r\n „Aha, ty myslíš vonku!“\r\n', 334, 4.02, 53),
	(11937, 'Aký je rozdiel medzi smrťou a hnačkou?\r\nKeď musíš tak musíš.', 68, 3.72, 53),
	(11938, 'ChuCk Norris je taký rýchly, že zje 2 cukríky skôr ako rozbalí ten prvý.', 79, 4.03, 53),
	(11939, 'Idú korytnačky po púšti. Idú 4 roky, 5 rokov, 6 rokov a na 7-mi rok jedna z korytnačiek nájde pohárik a pýta sa ostatných korytnačiek: \r\n- Zoberieme ten pohárik?\r\nA ostatné jej hovoria: - Nie, veď keď nájdeme studničku, tak jedna z nás sa preň vráti.\r\nIdú teda ďalej. Idú 4 roky, 5 rokov, 6 rokov a na 7-mi rok nájdu studničku. Jedna z korytnačiek hovorí druhej:- Choď po ten pohárik!Korytnačka ide a prejde 1 rok, 2 roky, 3 roky, 4 roky, 5 rokov a na 6-ty rok hovorí jedna ostatným korytnačkám: - Poďme ďalej, veď ona príde. \r\nA tá druhá vyjde z kríkov a hovorí: - Ale baby, keď si neveríme, tak ja nikam nejdem.', 657, 4.2, 53),
	(11940, 'Pýtajú sa ľudožrúta "Toto je vaše rodinné album?"\r\nNie, toto je moja kuchárska kniha.', 93, 3.76, 53),
	(11941, 'Učiteľka v škole hovorí žiakom:                 \r\n- Utvorte vetu so slovom Yeti.                  \r\nMarienka:                                    \r\n- Yeti je veľký snežný muž.                        \r\nJanko:                                            \r\n- Yeti žije v horách.                            \r\nMóric:                                          \r\n- Yeti zima?', 378, 3.5, 54),
	(11942, 'Úvaha učiteľa na hodine fyziky: \r\nKeby žiaci, ktorí sedia v zadných laviciach, boli tak ticho ako žiaci v stredných laviciach, ktorí si čítajú časopisy, mohli by žiaci v predných laviciach ďalej nerušene spať.', 227, 3.65, 54),
	(11943, 'Pýta sa učiteľ v triede školy technického zamerania:\r\n- Žiaci, ako by ste pomocou vody vyrobili svetlo?\r\nKdesi vzadu sa ozve:\r\n- A čo tak umyť okná?', 157, 3.7, 54),
	(11944, 'Ako sa povie po anglicky, že mi je zima?\r\n"Is me winter".', 58, 2.78, 54),
	(11945, 'Vybrané slovo po Š:\r\nŠušťákovyna.', 39, 3.17, 54),
	(11946, 'Letelo hovno ponad školu, padlo rovno pred zborovňu. Náš fyzikár veľkým skokom, skúma hovno mikroskopom. Chemikárka uvažuje, s čím to hovno reaguje. Zemepisár k mape beží, kde to hovno asi leží. A náš slávny dejepisár, do dejín ho hneď napísal. Slovenčinár sa raduje, že to hovno vyskloňuje. Telocvikár, istá vec, bude z neho športovec. Direktor je veľký znalec, strčil doňho celý palec. A náš riaditeľ sa priznal, že to hovno včera vysral...', 483, 4.08, 54),
	(11947, 'Učiteľka sa pýta žiaka:\r\n- Koľko rokov má dnes človek, ktorý sa narodil v roku 1964?\r\n- Muž či žena?', 111, 3.19, 54),
	(11948, 'Móricko pribehne na čerpaciu stanicu a hovorí:\r\n"Ujo, rýchlo nám dajte 10 litrov benzínu!"\r\n"A načo vám bude?"\r\n"Horí nám škola."', 140, 3.66, 54),
	(11949, 'Učiteľ sa pýta Móricka: \r\n- Keby si mal sedem cukríkov a ja by som ťa o dva poprosil, koľko by ti ich ostalo?\r\n- Sedem!', 126, 3.68, 54),
	(11950, 'Príde profesor na hodinu elektrotechniky s opravenými písomkami z minulej hodiny.\r\n- Študenti, veľmi ste ma nepotešili. Nečakal som nejaký žiarivý úspech, ale povedzte mi, čo si mám myslieť o študentovi, ktorý ako odpoveď na otázku "Nakreslite zapojenie Colpittsovho oscilátoru" nakreslil nemravný obrázok a pod neho napísal "Tak toto určite kmitať bude!"?', 380, 3.18, 54),
	(11951, 'V škole sa učiteľka pýta detí, čo doma jedávajú. Dôjde rad na Jožka a ten hovorí, že čaj. Všetci sa mu smejú. Na druhý deň to isté. Príde domov a sťažuje sa matke, že sa mu všetci smejú kvôli čaju. \r\n- Tak im zajtra povedz, že jedávame rezne\r\nStalo sa. Opäť tá istá otázka a keď dôjde rad na Jožka, ten povie, že rezne\r\n- Hej, a koľko si ich včera zjedol?  - pýta sa učiteľka\r\n- Tri hrnčeky...', 436, 3.53, 54),
	(11952, '- Kto z vás mi povie, na čo nám slúži drevo? - pýta sa učka v škole\r\nJožko sa hlási\r\n- ... sím z neho sa robia stromy!', 129, 3.15, 54),
	(11953, 'Učiteľka na južnom Slovensku hovorí deťom:\r\n- Deti, vytvorte mi vetu na slovo "hroch".\r\nAnička:\r\n- Hroch je veľký.\r\n- Dobre Anička - hovorí učiteľka.\r\nJanko:\r\n- Hroch je škaredý.\r\n- Dobre Janko - hovorí učiteľka.\r\nA na koniec hovorí Móricko svojim nosovým hlasom:\r\n- Na hroochu sa pošmykol Jánošík.', 322, 3.27, 54),
	(11954, 'Učiteľka napíše na tabuľu 2+2=\r\n- Aký je výsledok? - pýta sa Jožka\r\n- Vyrovnaný zápas.', 97, 3.48, 54),
	(11955, 'Učiteľka sa pýta Móricka:\r\n- No Móricko, čo nám dáva husička?\r\n- Sadlo.\r\n- Dobre a čo ešte?\r\n- Sadlo.\r\n- Tak to skúsime inak, kde spí tvoj otec?\r\n- V krčme.\r\n- Tak to nie a mamička?\r\n- U suseda.\r\n- No to tiež nie a kde spíš ty?\r\n- V postielke.\r\n- A čím sa zakrývaš?\r\n- Perinkou.\r\n- No a čo je v tej perinke?\r\n- Perie.\r\n- Tak čo nám ešte dáva husička?\r\n- Sadlo.', 388, 3.69, 54),
	(11956, 'Pani učiteľka sa pýta Jožka:\r\n- Zámená...\r\nJožko sa pýta:\r\n- Kto, ja?', 77, 3.28, 54),
	(11957, 'Oznam katedry fyziky:\r\nSkúška z predmetu CESTOVANIE V ČASE sa koná včera.  Stačí prísť.', 96, 3.55, 54),
	(11958, '- Deti, vymenujte aspoň jedného cicavca.\r\n- Prosím, komár.', 62, 3.04, 54),
	(11959, 'Pani učiteľka ukáže na obrázku zebru. Pýta sa detí, aké je to zvieratko. Nikto nevie a preto napovedá: \r\n- Z...\r\nNikto nevie. \r\n- Ze...\r\nStále sa nikto nehlási. \r\n- Zeb...\r\nPrihlási sa malý Móricko a hovorí: \r\n- Zeby to bol tiger?', 245, 3.29, 54),
	(11960, 'Nová učiteľka zemepisu mala prvú hodinu v triede, pred ktorou sa triasli skúsení profesori.\r\nPo začiatku hodiny sa pedagógovia zhromaždili v zborovni a tipli si, koľko minút vydrží. Ale trieda  zostala zatvorená až do zvonenia a potom začali cez prestávku vychádzať spokojní študenti. Niektorí mierili presne do knižnice.\r\n- Najskôr som ich ohromila a potom zaúlohovala.\r\n- A to ako? \r\n- Keď som vošla do triedy, pozdravila som "Ahoj zasrani, viete čo je prezervatív? A vie ho niekto natiahnuť na glóbus?" Lenže nikto nevedel, čo je glóbus, tak to začali zisťovať.', 601, 3.71, 54),
	(11961, 'Hodina biológie. Profesor hovorí študentom:\r\n"Čistý vzduch a hlboké dýchanie zničí všetkých pôvodcov našich chorôb."\r\nBlondínka zo zadu sa nástojčivo hlási:\r\n"Pán profesor, ale ako prinútime týchto pôvodcov, aby zhlboka dýchali?"', 252, 3.21, 54),
	(11962, 'Profesor a študent, ktorý práve vyletel zo skúšky, spolu stoja pri pisoári.\r\nŠtudent: \r\n- Konečne aspoň tu sme si rovnocenný.\r\nProfesor: \r\n- Áno, ale aj tu ťaháte za kratší koniec.', 195, 3.58, 54),
	(11963, 'Študenti medicíny na svojej prvej lekcii z patológie. Profesor sa hrá na drsňáka.\r\n"V márnici sú významné len dve veci. V prvom rade sa vám nič nesmie hnusiť. Robte to čo ja" - hovorí študentom. Potom zoberie skalpel, rozreže mŕtvemu pohlavný úd, strčí tam prst, povŕta s ním v otvore, potom si prst olíže. Študenti aj keď so sebazaprením nasledujú jeho príklad.\r\n"Tou druhou dôležitou vecou je to, že musíte byť pozorní. Ja som tam strčil ukazovák, ale olízal som si prstenník..."', 522, 3.23, 54),
	(11964, 'Na triede sa otvoria dvere a ihneď zabuchnú. Profesor sa spýta Fera sediaceho ihneď pri dverách:\r\n- Kto to bol?\r\n- Prievan.\r\n- A čo chcel?', 144, 3.23, 54),
	(11965, '- Pán profesor, veľmi sa bojím, že naša Janka tie maturity nespraví.\r\n- Stavte sa o desaťtisíc, že spraví!', 116, 3.61, 54),
	(11966, 'Predám učiteľku výtvarnej výchovy. Vie kričať, zjapať, kresliť a zapisovať pätorky.\r\nCena: tri jedničky z matiky.', 125, 3.05, 54),
	(11967, 'Učiteľka hovorí deťom, aby povedali, aké zamestnanie má ich otec, aby to vyhláskovali a povedali, čo robí.\r\nMaťko: "Môj ocko je murár, M-U-R-Á-R a stavia domy."\r\nJanko: "Môj ocko je lekár, L-E-K-Á-R a lieči ľudí."\r\nMbwonga: "Moj ocko je elektrikar, E-L-T..E-K-T..."\r\nUčiteľ zúfalý mu povie, nech ešte porozmýšla a potom mu povie.\r\nJožko: "Môj ocko je stávkar,S-T-Á-V-K-A-R a stavil by sa 20:1, že to ten neger nepovie správne."', 459, 3.3, 54),
	(11968, 'Dvaja študenti na intráku fantazírujú:\r\n- Čo keby sme začali chovať prasa?\r\n- Ti šibe? A čo ten smrad a špina?\r\n- Však si zvykne.', 140, 3.66, 54),
	(11969, 'Vieš čo vznikne skrížením krtka a žirafy?\r\nVrtná veža.', 62, 3.1, 54),
	(11970, 'Pani učiteľka sa pýta detí:\r\n- Kto mi povie jednoduchú vetu?\r\nPrihlási sa Anička a hovorí: \r\n- Dievča máva.\r\n- Dobre, teraz tú vetu rozviň.\r\n- Dievča máva na vojaka.\r\n- Dobre, teraz ju skráť.\r\n- Štetka.', 219, 3.78, 54),
	(11971, 'Rozprávajú sa dvaja študenti na intráku:\r\n"Počúvaj chovajme prasa", hovorí prvý.\r\nDruhý na to:\r\n"Si normalny? Špina, bordel, smrad."\r\nA prvý na to:\r\n"To nič, ono si zvykne."', 185, 3.15, 54),
	(11972, 'Učiteľka sa vadí s deťmi, lebo nemôžu pochopiť, že polovica nomôže byt väčšia ani menšia. \r\n- Ja už asi viem čím to bude. To bude asi tým, že väčšia polovica z vás ma vôbec nepočúva.', 208, 2.99, 54),
	(11973, 'Rozprávajú sa dvaja chlapci:\r\n- Dnes sme na telesnej behali dvanásťminútovku.\r\n- A za koľko si ju zabehol? ', 113, 2.7, 54),
	(11974, 'V škole majú malovať, a tak sa pani učiteľka pýta:\r\n"No tak nám povedz Dežko, tvoj ocinko je maliar, ako by si to tu vymaľoval?" \r\nDežinko:\r\n"No tak, sem by som nasral hnedú, sem by som prdol zelenú a tamto by som mrdol modrú." \r\nNo tak, to snaď nie je možné, ako to ten Dežko rozpráva: \r\n"Zavolaj mi ocinka do školy." \r\nUčiteľka: \r\n"Pozrite sa, ja som sa vášho syna pýtala, ako by to tu vymaľoval a on mi povedal toto." \r\n"Toto že vám vážne povedal?" \r\nOcko sa otočí k Dežinkovi a hovorí mu:\r\n"Ty debil, veď by to tu bolo moc tmavé!!!"', 571, 3.93, 54),
	(11975, 'Hovorí raz jedna učiteľka:\r\n"Raz som v lietadle sedela vedľa babičky s päťročným vnukom. Akonáhle sa dozvedela, že som učiteľka, začala na neho naliehať, aby mi predviedol, ako vie odpočítavať. Bez váhania spustil \'20, 19, 18...\'. \'Výborne\', pochválila som ho. \'To máš zo školy?\' \'Nie,\' odpovedal. \'Z mikrovlnnej rúry.\'"', 345, 3.28, 54),
	(11976, 'Pri záverečnej skúške z chirurgie sa profesor pýta študenta:\r\n- Prečo si chirurgovia pri operácii dávajú na tvár rúšku?\r\n- Aby ich nik nespoznal, ak sa operácia nepodarí.', 185, 3.23, 54),
	(11977, 'Móric v škole hovorí učiteľovi: \r\n- A moja sestra má osýpky. \r\n- Tak choď rýchlo domov, pretože môžeš nakaziť celú triedu. \r\nPo dvoch týždňoch sa Móric vrátil do školy a učiteľ sa ho pýta. \r\n- Tak ako sa má sestra? Už vyzdravela? \r\n- Neviem, ešte nepísala.\r\n- A kde preboha je? \r\n- No predsa v Austrálii.', 333, 3.34, 54),
	(11978, 'Na hodine dejepisu:\r\n- Čo bolo po smrti Karola Veľkého, žiaci?\r\n- Prosím pohreb.', 85, 3.27, 54),
	(11979, 'Sedia dvaja mat-fyzáci na lavičke pri Dunaji. On a ona. Krásny večer, slnko zapadá a odráža sa na vodnej hladine, ticho...\r\nOn: \r\n- Počuj, myslíš na to isté na čo ja?\r\nOna: \r\n- Áno.\r\nOn: \r\n- A koľko ti vyšlo?', 223, 3.55, 54),
	(11980, 'V škole sa učiteľka vypytuje prváka:\r\n"Máš nejaké ťažkosti s ušami, nosom..."\r\n"Áno."\r\n"Zle počuješ?"\r\n"Nie, ale zavadzajú pri obliekaní."', 153, 3.06, 54),
	(11981, 'Na hodine prírodopisu pani učiteľka vraví deťom:\r\n"Ak naučíte svoje zvieratko nejaký trik dostanete na konci roka Jednotku z Prírodopisu."\r\nNa koci roku prinesie Anička mačičku ako sa hrá s klbkom. Janko donesie psíka, ktorý si vie sadnúť. \r\n"Dobre máte jedničky."\r\nJožko donesie 10m dlhú anakondu, roztočí ju ponad hlavu  a tresk hlavou o tabuľu. Anakonda:\r\n"psssss"\r\nDruhý krát ju roztočí a znovu tres hlavou o tabuľu. Anakonda:\r\n"psssss"\r\nPani učiteľka už nevydrží:\r\n"Jožko ty nedostaneš jednotku z prírodopisu ale dvojku zo správania!"\r\n"Počkajte pani učiteľka my sme sa len rozcvičovali..."\r\nPo tretí krát roztočí z celej sily anakondu a tresk hlavou o tabuľu, Anakonda: \r\n"ssssss sssspieeevaky spieeeevanky...."', 764, 3.59, 54),
	(11982, 'Pani učiteľka sa pýta v 7. triede žiakov ako prichádzajú na svet deti. \r\n- Kto si myslí, že deti priniesol bocian, nech sa postaví na ľavú stranu a kto si myslí, že prišli na svet inakšie, nech sa postaví na pravú stranu. \r\nTu sa postaví Móricko a povie:\r\n- A ten, čo sa už miloval môže si ísť pofajčiť na chodbu?', 340, 3.6, 54),
	(11983, 'Janko dostane poznámku: \'Smrdí, umyť.\' Na druhý deň si číta učiteľka odpoveď od otca: \'Nečuchať, učiť.\'', 117, 3.61, 54),
	(11984, 'V škole dá učiteľka deťom úlohu, aby povedali príbeh, ktorý skončí vetou: "Mama je len jedna!". Prihlási sa Anička, známa bifloška a vraví: \r\n- Vždy, keď idem ráno do školy, moja mama ma učeše, aby som bola pekná. Moja mama je veľmi dobrá. Mama je len jedna!\r\nPrihlási sa Jožinko a vraví:\r\n- Moja mama mi každý deň urobí do školy desiatu, aby som nebol hladný. Mama je len jedna!\r\nNakoniec sa prihlási Móricko:\r\n- Keď som včera prišiel domov, otvoril som dvere a náš byt bol plný dymu od cigariet, na koberci bol fľak od rozliateho červeného vína a mama sedela v obývačke rozčapená v kresle. Zakričala na mňa, aby som jej z chladničky doniesol dve fľaše piva. Otvoril som chladničku a zakričal: \'Mama, je len jedna!\'', 772, 3.56, 54),
	(11985, 'Američania chcú vyslať špióna na Slovensko a rozhodnú sa, že najmenej nápadné bude, keď tam bude študovať na vysokej škole. Prvý adept sa ale po týždni vráti naspäť do Ameriky. \r\n- Ako to, že ťa odhalili? - pýta sa ho nadriadený. \r\n- No, prišli sme do školy, išli sme na prednášku a všetci tam spali, len ja som si zapisoval a tak ma odhalili. \r\nPošlú tam druhého, ale ten je tiež hneď späť. \r\n- Ako to, že ta odhalili, veď už si vedel ako na to? - pýta sa šéf. \r\n- No, prišli sme na prednášku, všetci spali a ja tiež. Potom  sme išli na intrák, všetci chlastali a húlili, ale ja nie, a tak ma odhalili.  \r\nAmeričania vyšlú tretieho adepta a ten sa vráti po pol roku. \r\n- Už si tam vydržal tak dlho, tak ako ťa mohli odhaliť? - pýta sa šéf. \r\n- No, keď sme boli na prednáškach, tak všetci spali a ja tiež. Keď sme boli na intráku, tak všetci chlastali a húlili a ja tiež. Potom ale prišlo skúškové, všetci to spravili, a len mňa vyrazili.', 1016, 3.6, 54),
	(11986, '- Môj dedko zbiera mince - hovorí Janko učiteľke. \r\n- Tak on je numismatik?\r\n- Nie, žobrák.', 97, 3.28, 54),
	(11987, 'Paní učitelka se ptá dětí ve škole, co jim doma ještě schází.\r\nPřihlásí se Janička a říká:\r\n"Nám schází auto."\r\nPřihlásí se Honzík a říká:\r\n"Nám schází chata."\r\nA tak se hlásí všechny děti jenom Pepíček,nic.\r\nPaní učitelka ho tedy vyzve a ptá se:\r\n"Vám doma nic nechybí?"\r\nA Pepíček odpoví:\r\n"Ne,včera se tatínek vrátil z hospody a ve dveřích říká: \'Tak jsem dneska chytil kapavku.\' A máma nato: \'Tak to je to poslední co nám ještě scházelo.\'"', 501, 3.31, 54),
	(11988, 'V prvej triede sa v septembri pýta pani učiteľka:\r\n- Kto vie, koľko je 1+2?\r\nNikto sa nehlási.\r\n- To naozaj nikto nevie?\r\nPo chvílke sa nesmelo prihlási jedno dievčatko: \r\n- Ja teda neviem koľko je 1+2, ale určite je to to isté, ako 2+1, pretože operácia sčítania je na telese reálnych číslic kumutatívna!', 324, 3.31, 54),
	(11989, 'Príde Janko totálne zhúlený do školy. Pani učiteľka sa ho pýta:\r\n- Janko, aké máme ročné obdobie?\r\n- Leto.\r\n- Janko, vonku opadáva lístie. Aké máme ročné obdobie?\r\n- Leto.\r\n- Janko, vonku je 18 stupňov, aké preboha leto?\r\n- Nahovno leto.', 257, 3.39, 54),
	(11990, 'Učiteľ sa pýta žiaka:\r\n- Čo sú to múmie?\r\n- Sušení Egypťania!', 71, 3.22, 54),
	(11991, 'Ferko ustavične vyrušuje a tyká pani učiteľke. Tá mu dá za trest napísať 100-krát vetu:"V škole sa správame slušne a netykáme pani učiteľke!!!"\r\nO deň prinesie Ferko domácu úlohu 200-krát napísanú. Pani učiteľka ho za to pochváli, ale v zápätí sa ho spýta prečo doniesol úlohu 200-krát a nie 100-krát? Ferko odpovedá:\r\n- Aby si mala radosť ty krava.', 384, 3.45, 54),
	(11992, 'Druhák Janko hovorí Evičke\r\n- Keď mi nedáš odpísať domácu úlohu, rozšírim po celej škole, že si ešte panna.', 122, 3.47, 54),
	(11993, 'Učiteľka nadáva žiakom:\r\n"Ak sa z matematiky nezlepšíte, prisahám, že vás nechám 80% prepadnúť!"\r\nZo zadnej lavice sa ozve smiech:\r\n"Cha cha, veď toľko nás tu ani nie je."', 186, 3.37, 54),
	(11994, 'Pri písomke pošepkal Jano svojmu susedovi:\r\n- Ten učiteľ je ale idiot!\r\nA od tabule sa ozvalo: \r\n- Nenapovedať! Každý na to musí prísť sám.', 150, 3.61, 54),
	(11995, '- No čo Peťo, aké bude vysvedčenie?\r\n- No, tato, hlavná vec, že sme zdraví.', 82, 3.32, 54),
	(11996, '- Prečo môj syn dostal zo zemepisu päťku?\r\n- Lebo hľadal Rimavskú Sobotu v kalendári!', 92, 3.15, 54),
	(11997, 'Mladá učiteľka s hlbokým výstrihom na šatách vojde do triedy. Fero z nej nespustí oči. \r\nUčiteľka povie:\r\n"Ak neprestaneš civieť, dostaneš jednu!"\r\n"Fantastické, a druhú?"', 187, 3.26, 54),
	(11998, 'Žiak, ktorý sa bojí gymnastiky sa pýta učiteľa telesnej výchovy:\r\n- Pán učiteľ, existuje taký papier, ktorý by ma oslobodil od gymnastiky?\r\n- Áno, úmrtný list. Ale ten dostaneš až po tom, čo sa pokúsiš o salto.', 230, 2.87, 54),
	(11999, 'Traja chlapci ťahajú na internát kravu. Vrátnik ich zastaví:\r\n- Kam s tou kravou?\r\n- Viete, máme radi mlieko, tak si ju budeme chovať a dojiť.\r\n- A čo ten smrad a neporiadok?\r\n- Hádam si postupne zvykne.', 213, 3.48, 54),
	(12000, 'Učiteľ: - Dnes vám odpadáva šiesta hodina.\r\nV zadnej lavici: - Čo odpadáva?\r\nSpolusediaca: - Hovno odpadáva.', 116, 2.79, 54),
	(12001, 'Otec sa pýta syna:\r\n- Čo sa teraz učíte v škole?\r\n- Hľadáme spoločného menovateľa.\r\n- To sa ešte nenašiel? Ja som ho hľadal, keď som ešte chodil do školy.', 170, 3.52, 54),
	(12002, 'Pani učiteľka sa pýta detí v škole,že aké majú doma živé zvieratká.\r\nJanko hovorí: My máme doma mačičku.\r\nPaľko zase: My máme doma prasiatko a psíka. \r\nUčiteľka pochváli oboch. \r\nPrihlási sa Móricko: My máme doma sovu na kolieskach.\r\nAle ty ma klameš,veď sova na kolieskach nie je živá,vraví uciteľka.\r\nAle Móricko jej hovorí: Však poďte so mnou domov a ja vás presvedčím.\r\nTak učiteľka išla k Mórickovcom a keď prišli dnu Móricko zvolá na dedka na invalidnom vozíku: Dedko priviedol som Ti prostitútku.\r\nA dedko na vozíku: Uu-uu-uu-...', 584, 3.41, 54),
	(12003, 'Pýta sa učiteľ dejepisu:\r\n-Čo vieme o ľuďoch, ktorí žili v stredoveku?\r\n-Že už všetci dávno pomreli.', 112, 3.38, 54),
	(12004, 'Pani učiteľka sa na hodine pýta Móricka:\r\n- Móricko, a ty čím chceš byť, keď budeš veľký?\r\n- Ovocím do jogobelly... ', 130, 3.43, 54),
	(12005, 'Učitel dal žiačkam napísať 3 diela od Shakespeara.\r\nPozrie jednej žiačke do poznámok a tam vidí čísla 10cm, 15cm, 20cm a 30cm. Učitel sa jej pýta, čo to znamená.\r\n"No 10cm to je Veľa kriku pre nič, 15cm to je Sen noci svetojánskej, a 20cm, Skrotenie zlej ženy."\r\nNa to sa učitel opýta: "A čo tých 30cm?"\r\n"To už je od Jana Nerudu, Kam s ním?"', 367, 3.24, 54),
	(12006, 'Pani učitelka: \r\n"Deti, kto vie nejakú vetu, kde sú použité slová \'rije\' a \'rýdzi\'. No, Janko, tak vieš?"\r\nJanko:\r\n"Ano. Mama rije v záhrade a tata rýdzi traktor."', 173, 3.23, 54),
	(12007, 'Slečna príde na skušku z anatómie. Pri odpovedi spomenie,že \r\npisky maju motorickú inerváciu (schopnosť vôľou uviesť do pohybu).\r\nSkúšajúci odpovie:\r\n"Slečna, ak mi tu zatlieskate, máte jednotku."', 212, 3.35, 54),
	(12008, 'Je koniec roka a deti dávajú pani učiteľke darčeky. Pani učiteľka povedala, že každým balíkom zatrasie a bude hádať čo v ňom je. Príde kvetinárova dcéra Alenka a pani učiteľka háda:\r\n- To sú kvety, však?\r\n- Áno, pani učiteľka.\r\nPodíde mäsiarov syn Peťo a pani učiteľka balíkom potrasie a hovorí:\r\n- To je šunka však?\r\n- Áno, pani učiteľka.\r\n- Ja ti pekne ďakujem.\r\nPríde vinárov syn Gejza, pani učiteľka balíkom zatrasie, začne z neho kvapkať záhadná tekutina. Pani učiteľka uchutná a háda:\r\n- To je víno, že?\r\n- Nie, pani učiteľka.\r\nOchutná znova a vraví:\r\n- Tak potom je to šampanské...\r\n- Nie.\r\n- Tak čo je to?\r\n- Šteniatko.', 689, 3.62, 54),
	(12009, 'Paní učitelka se ptá dětí ve škole:\r\n" Děti, kolik by jste unesli melounů? "\r\nHlásí se Anička: " Já bych unesla dva, jeden bych si dala pod pravou paži a druhý pod levou paži. "\r\nTu se hlasí Jaroušek: " Já bych unesl tři, jeden bych si dal pod pravou paži, druhý pod levou paži a třetí bych si napíchnul na ptáka. "\r\n" Ale Jaroušku, tak se přece nemluví ", kárá učitelka Jarouška.\r\nTu se hlásí Pepíček: " To já bych unesl pět melounů! "\r\n" Pepíčku to není možné, jak bys to udělal? ", ptá se učitelka.\r\n" No jeden bych si dal pod pravou paži, druhý pod levou paži a na ptáka bych si napíchnul Jarouška... "', 660, 3.49, 54),
	(12010, 'Stretnú sa dvaja študenti pred najťažšou skúškou za celý semester. \r\n- Čo si taký zničený?\r\n- Ale prosím ťa, sestra sa mi pokúsila o samovraždu.\r\n- A to prečo?\r\n- Čo ti poviem, pustila si nahlas hudbu, keď som sa učil.', 238, 2.71, 54),
	(12011, 'Čakanie\r\nUčiteľka dala žiakom slohovú úlohu s témou: Keby som bol riaditeľom firmy. Všetci žiaci sa pustili do písania, iba Matej nie.\r\n"Prečo nepíšeš?", pýta sa učiteľka.\r\n"Čakám na sekretárku."', 216, 3.32, 54),
	(12012, 'Učiteľ nemčiny hovorí:\r\n"Ak si slovo zopakujete 3 krát, tak bude vaše."\r\nZ poslednej lavice sa dievčenský hlas ozve:\r\n"Fero!Fero!Fero!"', 143, 4.23, 54),
	(12013, 'Prednáška biológie. Prednášajúci sa pýta.\r\n- Kto z vás vie, ktorý orgán sa pri súloží zväčší päťnásobne?\r\nKedže sa nik nehlási, pýta sa študentov, ktorí odpovedajú rovnako.\r\n- Viem, ale hanbím sa to povedať.\r\nNa to sa vzadu nesmelo prihlási jeden zo študentov a odpovedá.\r\n- Pán docent, je to zrenička.\r\n- Áno, správne, hovorí prednášajúci, a povedzte to všetkým, ktorí si mysleli, že je to penis!', 440, 3.58, 54),
	(12014, 'Janko príde domov a hovorí:\r\n- Dostal som päťku z matematiky a jednotku z hudobnej.\r\n- A to sa ti po tej päťke chcelo ešte spievať?', 139, 2.97, 54),
	(12015, 'Janko príde domov a mama sa ho pýta:\r\n- Janko, čo si dnes dostal v škole?\r\n- Dve poznámky. Prvú na matematike. Pani učiteľka sa má spýtala, že koľko je 5+6. Ja som povedal 11. Potom sa ma spýtala, koľko je 6+5? A ja som povedal: \'Mňa neojebete pani učiteľka.\' A druhú na Náboženstve. Pán farár sa vychvaľoval, že o všetkom vie. Ja som sa ho spýtal: \'Pán farár, viete aj o našej garáži?\' Povedal, že vie. A ja som povedal: \'Mňa neojebete pán farár, my garáž nemáme.\'', 503, 3.56, 54),
	(12016, 'Pani učitelka hovorí žiakom na prírodopise:\r\n"Na domácu úlohu budete mať porozprávať ako sa dostanú na svet deti."\r\nKeď prišiel Jurko domov hovorí:\r\n"Oci, máme na domácu úlohu porozprávat, ako sa dostanú deti na svet, nepomohol by si mi?"\r\n"Vieš čo zober si do tašky vtáka a na hodine ho ukáž pani učitelke." O týždeň sa ich učiteľka pýta:"\r\n"No deti, kto mi vie povedať, ako sa dostanú deti na svet?"\r\nNikto nemá domácu úlohu,len Jurko sa hlási.\r\n"No Jurko rozprávaj."\r\n"Počkajte,len vám ukážem vtáka."\r\n"Nie, nie netreba ,máš jednotku. "', 584, 3.43, 54),
	(12017, 'Učiteľ hovorí:\r\n- Jožo, tam vzadu bude ticho!\r\nZozadu sa ozve hlas:\r\n- Prosím, Jožo ešte neprišiel!\r\n- Tak až príde!', 126, 3.24, 54),
	(12018, 'Otec sa pýta:\r\n"Aká bola dnešná hodina chémie, Jožko?"\r\n"Učili sme sa vyrábať výbušninu!"\r\n"A zajtra čo budete robiť v škole?"\r\n"V akej?"', 151, 3.85, 54),
	(12019, 'Učiteľ karhá žiaka:\r\n- Jožko! Vravel si, že ideš na strýkov pohreb a teraz ťa tu vidím na futbalovom zápase!\r\n- Len počkajte na koniec zápasu, pán učiteľ! Môj strýko je totiž hlavný rozhodca!', 211, 3.25, 54),
	(12020, 'O štvrtej ráno zvoní profesorovi doma  telefón. Rozospatý profesor to dvihne.\r\n- Haló?\r\nA zo slúchatka sa ozve:\r\n- Spíš?\r\n- Spím...\r\n- No, a my sa kua ešte učíme!!!', 177, 3.56, 54),
	(12021, 'V škole na sexuálnej výchove začne Jano nahlas premýšľať: \r\n- To sú veci! To sú ale veci! Nikdy by som nepovedal, že baby hrajú v sexe takú dôležitú úlohu.', 172, 3.43, 54),
	(12022, 'Dekan sa pýta študenta: \r\n- Pán študent, prečo ste si vybrali štúdium práve na našej škole?\r\nŠtudent mu odpovedá:\r\n- Ale oci, prestaň s tými blbými otázkami.', 173, 3.57, 54),
	(12023, 'Na hodine literatúry sľubuje profesor jedničku tomu,kto prvý napíše päť Shakespearových hier. Jedna študentka sa okamžite prihlási a pôda mu lístok, na ktorom stojí: 10,15,20,25 cm.\r\n- Čo to má znamenať? - rozčúli sa profesor.\r\nSlečna vysvetľuje:\r\n- 10 cm predstavuje Mnoho kriku pre nič.\r\n- 15 cm Ako sa vám páči.\r\n- 20 cm Sen noci svätojánskej.\r\n- 25 cm Skrotenie zlej zeny.', 404, 3.3, 54),
	(12024, 'V škole: \r\n- Máš domácu? \r\n- Hej. \r\n- Tak nalej! ', 53, 3.51, 54),
	(12025, 'Hovorí učiteľ na fyzike:\r\n- Tak študenti, ako vidíte, nič nevidíte, ale prečo nič nevidíte, to hneď uvidíte.', 120, 3.35, 54),
	(12026, '"Tak deti, dnes sa budeme fotiť. Pekne sa na fotke usmievajte,\r\nto bude taká pamiatka. A keď za desať rokov vezmete tú fotku do rúk,\r\npozriete sa na ňu tak poviete, tak toto je Janko, ten je dnes\r\ninžinier, a toto je Marienka, tá má už tri deti, a peknú rodinku\r\nmá."\r\nA zo zadnej lavice sa ozve:\r\n"A toto bola naša učiteľka a tá je už dnes mŕtva."', 367, 3.11, 54),
	(12027, 'Nápis na školskej tabuli:\r\n"Ema má mamu. Mama má Danu. Otec sa má."', 72, 2.96, 54),
	(12028, 'Profesor chémie počas chemického pokusu:\r\n- Ako vidíte, nič nevidíte. A prečo nič nevidíte, to hneď uvidíte.', 119, 3.26, 54),
	(12029, 'Sedia dvaja prváci v lavici a jeden hovorí:\r\n- Ešte 54 rokov a pôjdeme do dôchodku...', 90, 3.47, 54),
	(12030, 'Učiteľ hovorí študentom po dovolenke v Afrike svoje zážitky zo safari:\r\n- Idem vám takto po tej buši, keď tu zrazu z krovia vyskočil lev. No vzal som nohy na plecia...\r\nV tom ich vyruší hlásenie v školskom rozhlase. Keď hlásenie skončí učiteľ chce pokračovať a pýta sa žiakov: \r\n- Kde som to skončil?\r\n- Tam ako ste vzal nohy na plecia.\r\n- Aha, no tak, vzal som nohy na plecia a lízal a lízal.', 420, 3.58, 54),
	(12031, 'V škole majú deti doniesť do školy nejaké cvičené zvieratko.\r\nV pondelok príde Anička a doniesie veveričku. Dvihne pravú ruku\r\nveverička ide doprava, ľavú ruku - veverička ide doľava.Všetci nadšene tlieskajú.V utorok donesie Zuzka akvárium s rybičkami. Pozrie sa doľava -rybičky plávajú doľava, pozrie doprava - rybičky plávajú doprava.Zas všetci tlieskajú.V stredu príde Móricko a donesie hada. Chytí ho za koniec, zatočí s ním okolo hlavy a tresne ho o lavicu. Had len syčí.\r\n"To nevyšlo."\r\nZas ho chytí a zas ho tresne o lavicu. Had zas len syčí.\r\n"Zas to nevyšlo."\r\nNo zas ho chytí, celou silou ho tresne o lavicu a had začne: "Ssssssssskákal pessss přessss ovessss."', 719, 3.11, 54),
	(12032, 'Syn sa v škole strašne zle učí. Otec nevie, čo s ním, preto mu hovorí:\r\n- Počúvaj, ak denesieš na vysvedčenie zle známky, pôjdeš do cirkevnej školy.\r\nSamozrejme, syn donesie samé trojky, štvorky, preto ho dajú do cirkevnej školy. \r\nPo polroku príde domov zo školy s polročným vysvedčením so samými jednotkami, dvojkami. Otec sa ho pýta, ako je to možné.\r\n- Prídem do triedy, nad dverami jeden ukrižovaný. V jedálni ďalší ukrižovaný. V izbe, ktorú mi pridelili nad postelou zasa jeden ukrižovaný. To vieš, tam sa s tebou neserú!', 570, 3.51, 54),
	(12033, '- Janko, máš rád matematiku?\r\n- Áno.\r\n- A kedy najviac?\r\n- V utorok.\r\n- A prečo práve v utorok?\r\n- Lebo vtedy ju nemáme.', 127, 2.96, 54),
	(12034, 'Aby sme mohli definovať rekurziu, tak musíme najprv definovať rekurziu.', 74, 2.95, 54),
	(12035, 'Príde zo školy syn a vraví: \r\n- Ocko! Ocko! Som múdrejší ako pani učiteľka!\r\n- A to je ako možné?\r\n- Pýtala sa nás, či nevieme koľko je 2 krát 4!', 160, 3.11, 54),
	(12036, 'Učiteľka hovorí Mišovi:\r\n- Prečo si dnes prišiel neskoro?\r\n- Pomáhal som starej babke prejsť cez prechod.\r\n- A to bola dve hodiny červená?\r\n- Nie. Len ona nechcela.', 174, 3.3, 54),
	(12037, 'Jožko píše test na hodine prírodopisu a dopĺňa:\r\nPríklad -Kravička sa otelila\r\n-Mačka sa okotila\r\n-Kobyla sa ožrebila\r\nJožko dopíše:-Žralok sa ožral.', 164, 3.44, 54),
	(12038, '- Pane, odviezli by ste ma do školy?\r\n- Ale ja idem opačným smerom.\r\n- Tým lepšie.', 87, 3.47, 54),
	(12039, 'Učiteľ:\r\n- Mirko, prečo je pod tebou mláčka?\r\n- Vyliala sa mi voda.\r\n- Prečo máš mokré nohavice?\r\n- Lebo tá voda tiekla spod nohavíc.', 144, 3.26, 54),
	(12040, 'Poznámka v žiackej knižke:\r\n- Žiak má ohováral za chrbtom do oči.\r\n- Žiak splachoval spolužiakovi hlavu do záchoda - nebezpečenstvo úrazu.\r\n- Žiak "je" na hodine.', 175, 3.21, 54),
	(12041, 'V škole:\r\n"Dežko čo za vtáka to visí nad tabuľou?"\r\n"Prosím pekne , za vtáka tam visí netopier."', 105, 3.29, 54),
	(12042, 'V škole prebieha pracovné vyučovanie. Učiteľ hovorí o bezpečnosti práce. A uvedie príklad.\r\n- Išiel chlapec po ulici a spadla mu na hlavu tehla. Chlapec umrel. A raz išlo dievča s prilbou, spadla na ňu tehla a ona sa iba usmiala a šla ďalej.\r\nOzve sa Móricko: \r\n- Áno, tu poznám, dodnes chodí v prilbe a usmieva sa.', 334, 3.52, 54),
	(12043, 'Šesťnásťročný syn donesie domov vysvedčenie, samá štvorka, jednoducho katastrofa. Mama hovorí otcovi: \r\n"Počúvaj, ty si hlava rodiny, tak sa s ním porozprávaj."\r\nOtec si zavolá syna do pracovne a vraví mu:\r\n"Synak, chcem sa s tebou vážne porozprávať, ako muž s mužom, ale aby sme nesedeli takto na sucho, čo si dáš? Whisky, gin s tonikom?"\r\n"Ale otec, veď ja nepijem."\r\n"Nič mi nehovor, viem ako to dnes chodí."\r\nOtec vytiahne Marlborky a vraví:\r\n"Daj si, veď viem, že fajčíš, ozaj a došiel mi nový Playboy, pozri si."\r\n"Ale, otec, ja ..."\r\n"Nič mi nehovor, chcem sa s tebou porozprávať ako muž s mužom, dobre?"\r\nTak popíjajú, fajčia, mladý pozerá Playboy.\r\n"Dobre otec, tak ak môžem, rád by som sa spýtal, kto do pekla má tieto baby v posteli?"\r\n"A sme pri tom, synak. Jednotkári!"', 834, 3.45, 54),
	(12044, 'Vzdychne si študent pred skúškou:\r\n- Ach, keby sme tak boli na Mesiaci.\r\n- A to už prečo? - pýta sa ho priateľ.\r\n- Lebo na Mesiaci je všetko 6-krát ľahšie.', 166, 3.21, 54),
	(12045, 'Učiteľka kričí na žiakov:\r\n- Takže sa nikto nehlási? No dobre teda. Rýchlo jeden spredu a jeden zozadu!', 111, 2.97, 54),
	(12046, 'Učiteľ sa pýta triedy:\r\n- Čo je vietor?\r\n- Výdych, čo sa ponáhľa!', 73, 3.35, 54),
	(12047, 'Pýtajú sa detí v škole:\r\n- Ako sa voláš?\r\n- Janko.\r\n- A čím chceš byť?\r\n- Neviem.\r\n- A ty sa ako voláš?\r\n- Neviem.\r\n- A čím chceš byť?\r\n- Policajtom.', 165, 3.43, 54),
	(12048, 'Učiteľka sa pýta detí:\r\n- Deti, kto si myslí, že je sprostý, nech sa postavý? \r\nMalý Bafo vstane.\r\n- Malý Bafo, prečo si myslíš, že si sprostý?\r\n- Pani učiteľka, ja si to nemyslím, ale nechcel som vás v tom nechať samú.', 240, 3.43, 54),
	(12049, '- Čo si dnes dostal? - pýta sa mamka Ferka, keď prišiel zo školy.\r\n- Dve jednotky a poznámku!\r\n- Za čo tú poznámku?\r\n- Za to, že som si prepísal známky!', 164, 2.81, 54),
	(12050, 'V škole sa učia o partizánoch. V tom sa prihlási Jožko a vraví:\r\n- Aj môj dedo bol partizán ale on bol elektrikár.\r\n- A ako to vieš? - pýta sa učiteľ.\r\n- No, lebo mal na prilbe dva blesky.', 201, 3.04, 54),
	(12051, 'Na hodina chémie sa učiteľ pýta: \r\n- Kto nám povie, ako sa dá pomocou vody získať svetlo? \r\n- Stačí umyť okno, pán učiteľ.', 136, 3.44, 54),
	(12052, 'Prečo medici nemajú jarné prázdniny?\r\nLebo by si cez ne urobili ekonomickú školu.', 87, 2.75, 54),
	(12053, 'Príde Janko zo školy domov a hovorí mame.\r\n- Mami, dostal som poznámku.\r\n- A čo si robil?\r\n- Smial som sa učiteľke za chrbtom do očí.', 142, 2.99, 54),
	(12054, 'Hovorí profesor na prednáške študentom:\r\n- Keby ste sa vy tam vzadu nerozprávali tak nahlas, tí v strede by mohli pokojne lúštiť krížovky a tí v predu by mohli pokojne späť.', 187, 3.2, 54),
	(12055, 'Otec krúti hlavou nad synom, ktorý sa sa práve vrátil zo skúšky, ako inak, neúspešne:\r\n- Synku, synku, čím som ťa spravil, tým si aj ostal...', 153, 3.46, 54),
	(12056, 'Pani učiteľka sa pýta v škole detí.\r\n"Deti, čo robíte doma keď vypnú prúd?"\r\nJanko sa postaví a odpovie:\r\n"Zapálime sviečky a pozeráme televízor."', 161, 2.96, 54),
	(12057, 'Učiteľka sa pýta žiakov ,že komu ešte čo chýba doma. Prihlási sa Janko:\r\n" My nemáme farebný televízor."\r\nPrihlási sa Jožko:\r\n"My  nemáme video."\r\nLen Števko sedí a nehlási sa.\r\n"Števko prečo sa nehlásiš, veď ja som už bola u Vás a viem, že ešte všeličo nemáte."\r\n"Lenže včera večer prišiel domov otecko opitý, vygrcal sa do skrine a mama na to:\r\n"Už len to nám chýbalo!"', 409, 3.2, 54),
	(12058, 'Čínania robia prieskum. Zisťujú, za koľko sa dokážu študenti naučiť čínštinu. Pýtajú sa študenta na Oxforde, za koľko to zvládne. Študent odpovie: \r\n- Za dva roky.\r\nŠtudenta z Harwardu sa tiež pýtajú.\r\n- Za rok sa do dá.\r\nPrídu na Žilinskú Univerzitu, spýtajú sa študenta. Študent vytiahne sluchátka z uši:\r\n- A sú skriptá?\r\n- Sú.\r\n- Tak ma zapíšte na piatok na skúšku.', 409, 3.5, 54),
	(12059, 'Na hodine chémie:\r\n- Jurko, povedz mi, čo má chemickú značku H2SO4?\r\n- Hm... mám to na jazyku.\r\n- Tak to rýchlo vypľuj, lebo je to kyselina sýrová.', 157, 3.03, 54),
	(12060, 'Sedia dvaja malí prváci a jeden hovorí druhému:\r\n- Už len 54 rokov a ideme do dôchodku.', 93, 2.94, 54),
	(12061, 'Príde Janko do školy a učiteľka si pýta úlohu. Chvíľu sa na ňu pozerá a vraví:\r\n- Janko to si nepísal ty! Povedz, kto ti písal domácu úlohu!\r\n- Viete pani učiteľka, to mi písal otecko.\r\n- Tak mu odkáž, že Wolker bol Jiří a nie Johny!', 256, 2.98, 54),
	(12062, 'Mama sa pýta Janka: \r\n- Keď ti dám tri oriešky a potom štyri, koľko budeš mať orieškov?\r\n- Neviem.\r\n- A to ste sa v škole ešte neučili?\r\n- Učili, ale s jabĺčkami.', 177, 2.88, 54),
	(12063, 'Ako sa volá western spoza školských lavíc?\r\nSedem nedostatočných.', 71, 3.17, 54),
	(12064, 'V prvním ročníku na medicíně přednáší profesor a povídá:\r\n"Pánové a dámy, v medicíně je ze všeho nejdůležitější pozorování. Jako lékaři musíte být velmi pozorní a vnímaví na události, barvy, vůně a chuti."\r\nNato zvedl z katedry kádinku se žlutou, čirou tekutinou:\r\n"Tohle je lidská moč."\r\nStrčil do kádinky prst, poté ho olízl. Celá posluchárna vyvalila oči, někteří je znechuceně odvrátili. Profesor podal kádinku studentovi na kraji první řady. Ten, stejně jako po něm všichni ostatní, nakonec nechal zvítězit své lepší, studijní já, strčil do kádinky prst a olízl ho. Když kádinka oběhla celou posluchárnu, profesor s úsměvem pravil:\r\n"Máte za sebou první lekci z pozorování. Bohužel, nikdo z vás nebyl dost pozorný. Kdybyste mě opravdu dobře sledovali, všimli byste si, že do kádinky jsem namočil ukazováček, ale olízl jsem si prostředníček."', 939, 3.16, 54),
	(12065, 'Jožko bol dlho v noci na rybačke,preto si v škole zdriemol.Učitel mu dohovára:\r\n- Jožko, ty si celú moje hodinu prespal!\r\n- No čo! - bráni sa Jožko - Vy ste minule pretiahli úsečku.', 193, 3.2, 54),
	(12066, 'Na nástenke v študentskom domove:\r\n\'Vážení študenti! Nevyhadzujte odpadky von oknom. Deti ich tam zbierajú a nafukujú!\'', 127, 3.61, 54),
	(12067, 'Jožko sa vráti zo školy a mama sa pýta: \r\n- Páčilo sa ti v škole? \r\n- Áno. \r\n- Hlásil si sa? \r\n- Áno. \r\n- Vyvolala ťa učiteľka? \r\n- Áno. \r\n- Vedel si? \r\n- Áno. \r\n- Na čo sa ťa pýtala? \r\n- Kto si prdol.', 219, 3.26, 54),
	(12068, 'Otec sa pýta syna, ktorý sa práve vrátil z maturity, ako bolo.\r\n- Vieš, oci, celá maturita prebiehala pobožne.\r\n- A to akože ako?\r\n- To vieš, skúšajúci bol v čiernom, ja som bol v čiernom. On položil otázku, ja som sa prežehnal. Ja som odpovedal, on sa prežehnal.', 281, 2.95, 54),
	(12069, 'Na prednáške z medicíny prednáša profesor v preplnenej prednáškovej sále a pýta sa študentov:\r\n"Ako sa povie mužovi, ktorý by strašne rád súložil, ale nemôže?"\r\nA všetci zborovo:\r\n"Impotent!"\r\nDobre, to bola ľahká otázka. Položím Vám inú. Ako nazývame muža, ktorý by aj mohol súložiť, ale sa mu vôbec nechce?"\r\nV sále nastal ruch, študenti si šepkajú, ale správnu odpoveď nepoznajú. Vtom vyskočí zo stoličky blondínka a zakričí:\r\n"Hajzel je to! Obyčajný hajzel!"', 510, 3.12, 54),
	(12070, 'Pani učiteľka sa pýta Ferka:\r\n"Povedz nám čo všetko sa dá jesť."\r\n"Napríklad jablko, svetlo,..."\r\nPani učiteľka sa prekvapene pýta:\r\n"Svetlo sa dá jesť?"\r\n"Ja som išiel včera večer okolo maminej izby a tá hovorí ockovi: Zhasni svetlo a daj mi ho do úst."', 274, 3.47, 54),
	(12071, 'V škole sa pani učiteľka pýta Janka:\r\n- Janko, máš domácu úlohu?\r\n- Ta ne!\r\n- Odpovedaj celou vetou!\r\n- Ta nemám.', 122, 3.15, 54),
	(12072, 'Detičky majú v škole nemčinu a majú hovoriť názvy kvetov.\r\nAnička: „Die Rose."\r\nUčiteľka: „Schön, Anička, schön."\r\nJanka: „Der Tulipan."\r\nUčiteľka: „Schön, Janka, schön."\r\nMóricko: „Der Orgasmus."\r\nUčiteľka: „Móricko, ale veď to nie je kvetina!"\r\nMóricko: „Nevadí, ale je to schön."', 321, 3.24, 54),
	(12073, 'Profesor hovorí: \r\n- Dnes vás pustím o štvrť hodinu skôr. Odchádzajte prosím potichu, aby ste nezobudili nikoho vo vedľajších učebniach.', 148, 3.17, 54),
	(12074, 'Kedy si žiaci začnú robiť konečne domáce úlohy?\r\nKeď bude na škole zavedená sexuálna výchova.', 105, 3.06, 54),
	(12075, 'Ide profesorka matematiky po chodbe, potkne sa a spadne. Všetci žiaci, ktorí ju zbadajú, ju obídu. Až jeden nesmelý študent jej pomôže postaviť sa. A profesorka povie:\r\n- Všetci tí fagani, ktorí mi nepomohli dostanú päťku.\r\nA študent na to:\r\n- Ale vy ich neučíte.\r\nA profesorka odvrkne:\r\n- Tak dám päťku tebe!', 332, 3, 54),
	(12076, 'Ferko sa vyhráža spolužiačke v 5.C:\r\n- Ak mi nedáš opísať domácu úlohu, tak potom roznesiem po celej škole, že si ešte panna!', 138, 3.45, 54),
	(12077, 'Na telocviku učiteľ žiakovi:\r\n- Takú ti jednu strelím, že ťa budú v Maďarskú pokutovať za rýchlosť!', 112, 2.93, 54),
	(12078, 'Malý Matúš príde domov a otec sa ho pýta.\r\n- Tak čo je nového v škole?\r\n- Päťka a päťka.\r\n- Čo?\r\n- A štvorka.\r\n- To nemyslíš vážne.\r\n- Ale neboj sa, tie známky už neplatia.\r\n- To mi odľahlo. A prečo?\r\n- Lebo ma vyhodili zo školy.', 252, 2.85, 54),
	(12079, 'Učiteľka sa v škole pýta:\r\n"Čo si želáš na Vianoce Móricko?"\r\n"Ja chcem autíčko."\r\n"To je pekné, a ty Anička?"\r\n"Ja chcem peračník."\r\n"Aj to je veľmi pekné, a ty Janko?\r\n"Ja chcem AIDS."\r\n"A prečo?"\r\n"Nó, odo mňa by ho dostala sestra, od sestry otec, od otca mama a od mamy sused, sviňa jedna, pošliapal mi vláčik."', 339, 3.15, 54),
	(12080, 'Pani učiteľka sa príde k Mórickovím rodičom sťažovať,že v triede Móricko na tabuľu nakreslil posšvu. Mórickový rodičia hovoria:\r\n"On ju nakreslil aj doma na trúbu, a náš dedo si popálil jazyk."', 213, 3.03, 54),
	(12081, 'Učiteľka v škole na výtvarnej výchove zadala úlohu, aby deti nakreslili, ako si predstavujú koniec sveta. Pri kontrole výkresov u Dezidera našla nakreslené len dve bodky. Dežo to vysvetlil tak:\r\nMám tri sestry, každý mesiac si značia do kalendára bodku. Keď tam minulý mesiac boli len dve, matka skríkla:\r\n"Koniec sveta!"', 340, 3.17, 54),
	(12082, 'Viete prečo chcú mať učitelia na hodine ticho?\r\nAby počuli, kedy zazvoní na koniec hodiny.', 96, 2.73, 54),
	(12083, 'Ptá se paní učitelka dětí ve škole: \r\n- Tak dětičky moje, kdo mi poví nějaký slavný výrok nějaké významné osobnosti?\r\nHlásí se Janička: \r\n- A přece se točí - Galileo Galilei.\r\nHlásí se Jiříček: \r\n- Učit se, učit se, učit se - Lenin.\r\nHlásí se Pepíček: \r\n- Do prdele, tyhle hodiny se nám do gazíku nevejdou - maršál Malinovskij na Staroměstském náměstí v roce 1945.', 408, 2.95, 54),
	(12084, 'Profesor sa pýta na skúške študenta:\r\n- A teraz by ste sa mohli pokúsiť vysvetliť, kam smeruje transformácia spoločnosti.\r\n- Pán profesor, ešte pred hodinou som to vedel, ale zabudol som to.\r\n- Človeče nešťastný, ste jediný človek, ktorý to vedel a vy to zabudnete?', 284, 3.21, 54),
	(12085, 'Rozprávajú sa dvaja študenti medicíny v septembri:\r\n- Ešte sa dva razy vyspíme a sú tu Vianoce.', 102, 3.23, 54),
	(12086, '- Jožko, čo to robíš pod tou lavicou?\r\n- Buď sa tak sprosto nepýtajte, alebo nenoste minisukne.', 101, 3.06, 54),
	(12087, 'Príde učiteľka do triedy a vidí, ako Móricko robí niečo pod lavicou. Pýta sa ho:\r\n- Čo to robíš?\r\nMóricko:\r\n- Buď sa blbo nepýtajte, alebo nenoste minisukňu.', 172, 3.03, 54),
	(12088, 'Móricko sa nenaučil a pani učiteľka sa mu chystá dať pätorku.\r\n- Pani učiteľka, nechcem vás strašiť, ale otec mi povedal, že ešte jedna päťka a niekto tu dostane do držky!', 188, 3.29, 54),
	(12089, 'Príde matfyzák do fotolabu: \r\n- Potreboval by som vyvolať fotky. \r\n- 9 na 13? \r\n- 2541865828329. Prečo sa pýtate?', 118, 4.14, 54),
	(12090, 'Rozprávajú sa v škole dvaja spolužiaci:\r\n- Čo si dostal na Vianoce?\r\n- Epileptický záchvat.', 98, 3.35, 54),
	(12091, 'Profesor so sklerózou rozpráva zážitok z dovolenky:\r\n- Idem po Afrike a zrazu lev. Rýchlo hodím nohy na plecia a ...  \r\nVtom mu zvoní telefón. Po skončení hovoru sa pýta kde skončil. Žiaci na to:\r\n- Dali ste nohy na plecia.\r\n- Jaj... vzal som nohy na plecia a ako lížem tak lížem...', 299, 2.97, 54),
	(12092, 'Dežko sedí v škole na hodine a rozmýšľa:\r\n- Čo robiť!? Mám prestať fajčiť? Alebo by som mal prestať chlastať!? Či prestať sexovať s Araňou? Či sa vykašlať na marihuanu?\r\nVtom k nemu pristúpi pani učiteľka a pýta sa:\r\n- Dežo, koľko je dva krát dva?\r\n- Teda, pani učiteľka, ja by som chcel mať vaše problémy.', 339, 2.96, 54),
	(12093, 'Estera, zopakuj čo som Vám na poslednej hodine rozprávala o Mojžišovi.\r\n- Mojžiš bol synom egyptskej princezny.\r\n- Ale Estera, nadávala si pozor! Princezna ho iba našla v košíku, ktorý plával v Níle.\r\n- To vraví ona!', 231, 3.06, 54),
	(12094, 'Nadáva žena mužovi:\r\n"Počúvaj ten náš syn sa tak zle učí, zase dostal päťku, porozprávaj sa s nim!"\r\n"No dobre, zavolaj ho!"\r\nTatko si sadne so synom do obývačky a hovorí:\r\n"Jožo, fajčíš?"\r\n"Sem tam."\r\n"Tak si zapáľ.", povie otec a ponúkne syna malborkou. \r\n"Jožo, piješ?"\r\n"Občas."\r\n"Tak sa napi.", povie otec a ponúkne syna fajnovým koňakom. \r\n"Jožo a baby sa ti páčia?"\r\n"Jasné."\r\n"Tak sa pozeraj.", povie otec a vytiahne zo stolíka playboya. \r\nA ako tam tak sedia, cigaretka, koňačik, nahé baby, syn hovorí otcovi:\r\n"To je super, to si všetci tak fasa žijú?"\r\n"Nie synu, len jednotkári, čistý jednotkári."', 653, 3.06, 54),
	(12095, 'Učitelka povídá dětem: \r\n"Děti teď my vymyslete větu kde bude základem slovo "čelo".\r\nPřihlásí se Janička a povídá: \r\n"Moje starší sestra hraje na violončelo."\r\n"Výborně", chválí jí paní učitelka.\r\nDál se hlásí Kubík a povídá: \r\n"Můj tatínek má vysoké čelo."\r\nUčitelka ho opět pochválí a vidí,že se hlásí Pepíček, známý třídní sprosťák. Přemýšlý jestli ho má vyvolat, aby neřekl zase nějakou sprosťárnu ale nakonec ho vyvolá.\r\nPepíček povídá: \r\n"Naši včera šoustali až to řinčelo!"', 554, 3.09, 54),
	(12096, 'V škole pre dementných sa učiteľka pýta: \r\n- Koľko je 8x2? \r\nPrihlási sa jeden:\r\n- Milión.\r\nDruhý odpovedá:\r\n- Utorok \r\nTretí vraví:\r\n- 16. \r\nUčiteľka sa pýta:\r\n- Ako si na to prišiel?\r\n- Milión som vydelil utorkom.', 232, 3.21, 54),
	(12097, 'Príde učiteľka do školy a hovorí deťom.:\r\n"Kto uhádne moju hádanku dostane jednotku. Je to biele a lieta to na nebi?"\r\nPrihlási sa Jožko a vraví:\r\n"Hus."\r\n"Môže byť,ale je to labuť!"\r\nOpäť hovorí učiteľka hádanku:\r\n"Je to chlpaté a behá to po dvore."\r\nV tom sa opäť prihlási Jožko a vraví:\r\n"Mačka."\r\n"Môže byť ,ale je to pes!"\r\nJožko sa naštve a vraví učiteľke:\r\n"Teraz dám hádanku ja Vám! Keď to dávate do úst je to tvrdé a suché, a keď to vyberáte je to mäkké a vlhké! čo je to?"\r\nUčiteľka rozmýšľa a po krátkej úvahe príde k Jožkovi a dá mu facku.\r\nA Jožko vraví:\r\n"Môže byť, ale je to žuvačka!"', 667, 3.39, 54),
	(12098, '- Žiaci , už pol roka Vám vysvetľujem, že polovice sú vždy rovnaké a ešte stále to vačšia polovica z vás nevie.', 124, 3.18, 54),
	(12099, '- Jožko, čo tam gumuješ? \r\n- Prosím, pán učiteľ, veď ste mi povedali, aby som si tú päťku opravil.', 109, 2.98, 54),
	(12100, 'Na náboženstve:\r\n- Jožko, kde býva Ježiško?\r\n- V našej kúpeľni.\r\n- A prečo?\r\n- Lebo ocko včera povedal "Ježiši, ešte stále si v tej kúpeľni?".', 159, 3.12, 54),
	(12101, 'Na hodine vlastivedy sa Janko nepretržite hlási. Pani učiteľka sa domnieva, že jej chce vymenovať svetové strany. Vyvolá ho. Janko jej hovorí: \r\n- Prosím ja by som chcel ísť na záchod.\r\n- Ale veď tie strany mi stihneš vymenovať.\r\n- Hmmmm VÝCHOD ... ZÁCHOD ... SEREM ... JUJ!', 292, 3.19, 54),
	(12102, 'Dekan  : "Pán kolega, prečo ste sa rozhodli študovať práve na našej fakulte?"\r\nŠtudent: "Ale oci, nechaj tie blbé otázky."', 131, 2.77, 54),
	(12103, 'Príde učiteľka do triedy a hovorí žiakom:\r\n- Dnes budeme počítať s kalkulačkami.\r\nDeti sa začnú tešiť a učiteľka ďalej hovorí:\r\n- Koľko je 590 kalkulačiek a 790 kalkulačiek?', 193, 3.25, 54),
	(12104, '"Tak čo, aký je ten váš nový učiteľ matematiky?"\r\n"Zdá sa, že je nejaký moc nábožný."\r\n"Prečo myslíš?"\r\n"Keď skúša, tak stále opakuje: Bože, bože..."', 171, 3.14, 54),
	(12105, 'Móricko vbehne do triedy 5 minút po zvonení bez klopania:\r\n"Móricko, pekne sa vráť za dvere a vojdi ešte raz, ale tak, ako by vošiel napríklad  tvoj otecko!"\r\nMóricko vyjde, za chvíľu zvonku rozkopne dvere, vrazí do triedy a zrúkne:\r\n"Tak čo Vy kurvy! Nečakali ste ma, že?"', 290, 3.51, 54),
	(12106, '"Študent! Prečo mi tu na prednáške spíte?"\r\n"Ja nespím, iba tak pomaly mrkám."', 85, 3.21, 54),
	(12107, '"Móricko, kde máš žiacku knižku?"\r\n"Požičal som ju Marienke, chcela vystrašiť rodičov."', 97, 2.74, 54),
	(12108, 'Móricko prišiel neskoro do školy:\r\n"Prečo si sa omeškal?"\r\n"Lebo som chcel ísť s otcom na ryby. Ale nakoniec ma so sebou nevzal."\r\n"Tak je to správne. A dúfam, že ti vysvetlil, prečo sa škola nemá vynechávať?"\r\n"Nie. Hovoril, že pre dvoch by bolo málo červíkov."', 281, 3.27, 54),
	(12109, 'Aký je rozdiel medzi pitbullom a 73 ročnou matematikárkou?\r\nPitbull má zuby!', 80, 3.25, 54),
	(12110, 'Móricko vtrhne do triedy ako uragán a učiteľ ho posiela naspäť:\r\n- Vráť sa za dvere a vojdi ešte raz a poriadne.\r\nMóricko sa otočí a ako ide, mrmle si pod nos:\r\n- Ako keby som bol dajaký Windows!', 208, 2.89, 54),
	(12111, 'Janko učiteľke stále drzo tyká. Učiteľka sa naserie a vrieska:\r\n- Čo si to dovoľuješ?! Čo som s tebou husi pásla?\r\nJanko dotknuto odvrkne: \r\n- S tebou by som husi v živote nepásol!', 193, 2.99, 54),
	(12112, '- Ocko, vieš sa podpísať aj potme?\r\n- Jasné.\r\n- Aj do žiackej knižky?', 75, 3.22, 54),
	(12113, 'Pani učiteľka preberá v škole anatómiu ľudského tela.\r\nUkazuje na obrázku pľúca, a pýta sa detí:\r\n- Videl z vás niekto pľúca?\r\nMalý Dežinko sa hlási a hovorí:\r\n- Sím, pani učiteľka, ja som videl pľúca. Naša mamička, keď sa umýva, tak jej visia až do lavóra.', 287, 3.12, 54),
	(12114, 'Na hodine slovenčiny. Deti majú písať sloh na tému "Som riaditeľom veľkej firmy". Zatiaľ, čo všetky deti píšu, Jožko spokojne sedí za stolom a obzerá sa po triede.   \r\n- Jožko, prečo nepíšeš? - pýta sa pani učiteľka.\r\n- No dovoľte?! Čakám na sekretárku!', 280, 2.9, 54),
	(12115, 'Učiteľka na hodine sexuálnej výchovy sa pýta žiakov:\r\n- Žiaci, ktorí si myslíte, že deti nosí bocian, postavte sa napravo. Tí, čo si myslia niečo iné naľavo.\r\nPrihlási sa Móricko:\r\n- Pani učiteľka, tí čo už súložili si môžu ísť na chodbu zapáliť?', 277, 3.31, 54),
	(12116, 'Pýta sa otec malého Robka:\r\n- Rád chodíš do školy?\r\n- Áno, veľmi. Aj rád sa z nej vraciam. Len to nemám rád, že tam musím medzitým zostať.', 153, 3.26, 54),
	(12117, 'Pani učiteľka na výtvarnej výchove dala nakresliť lokomotívu. Paľko zatiaľ nič nenakreslil. Pani učiteľka hovorí:\r\n- Paľko, prečo si nič nenakreslil?\r\n- Ja som ju nakreslil, ale lokomotíva mi utiekla.', 216, 2.79, 54),
	(12118, 'Na hodine chémie. \r\n- Ak sa nám tento pokus nevydarí, všetci vyletíme do vzduchu. A teraz pristúpte bližšie.', 116, 2.99, 54),
	(12119, 'Pani učiteľka sa pýta žiakov v škole, aby vymenovali nejaký priehľadný predmet. Žiaci postupne odpovedajú: \r\n- Okno.\r\n- Sklo.\r\nMóricko sa zo zadnej lavice veľmi hlási, tak ho pani učiteľka vyvolala. A z nedočkavého Móricka vyhŕklo:\r\n- Pani učiteľka no však rebrík.', 287, 2.84, 54),
	(12120, '- Gusto, čo si nakreslil? \r\n- Kravu, ktorá žerie trávu a ďatelinu.\r\n- A kde je ta tráva a ďatelina? - pýta sa pani učiteľka. \r\n- Krava ju zožrala.\r\n- A kde je tá krava?\r\n- Odišla, lebo už všetko zožrala.', 219, 3.32, 54),
	(12121, 'Študent herectva píše domov:\r\n"Už som dostal aj prvú úlohu: hrám 20 rokov ženatého."\r\nOtec mu odpisuje:\r\n"Neboj, časom dostaneš aj rolu s textom."', 157, 2.91, 54),
	(12122, 'Dvaja hladní študenti fantazírujú:\r\n"Až budeme mať za čo, kúpime si peceň chleba a budeme jesť! Ja si odhryznem, ty si odhryzneš, ja si odhryznem, ty si odhryzneš, ja si odhryznem, ja si odhryznem, ty si odhryzneš."\r\nPleesk! Ozvala sa rana poza uši.\r\n"Za čo?"\r\n"Že si si dva razy za sebou odhryzol."', 315, 3.25, 54),
	(12123, 'Príde podnapitý študent na skúšku a pýta sa skúšajúceho:\r\n"Pán profesor, môže aj opitý študent spraviť skúšku?"\r\n"Ale áno, všetko je možné."\r\nTak študent sa zdvihne, príde ku dverám a zakričí na chodbu:\r\n"Hej, chlapi, môžete ho doniesť!"', 266, 3.47, 54),
	(12124, '- Janko, máš urobenú domácu úlohu?\r\n- Áno!\r\n- Odpovedaj celou vetou!\r\n- Áno, kurva!', 90, 3.25, 54),
	(12125, 'Pani učiteľka vysvetľuje žiakom:\r\n- Abecedu máme od Rumunov, keramiku od Číňanov a listiny od Fínov. Viete mi povedať podobný príklad?\r\nJanko sa prihlási a vraví:\r\n- Vysávač máme od luxu, mixér od ety a peniaze zo sporiteľne.', 244, 3.08, 54),
	(12126, 'Príde Brandon do školy a tam stojí Steve pri svojej skrinke a plače.\r\nBrandon: \r\n- Ahoj, Steve, čo sa ti stalo?\r\nSteve: \r\n- Keď som si zaväzoval topánky, utrhla sa mi šnúrka.\r\nBrandon: \r\n- A nechceš si o tom pohovoriť?', 230, 3.29, 54),
	(12127, 'Príde 73 rokov stará učiteľka matematiky do triedy vyučovať a zisťuje, že v nej sedí len jeden žiak. Pýta sa ho: \r\n- A kde je zvyšok?\r\nA žiak odpovedá: \r\n- Neviem, ale ja som školník a toto je kotolňa!', 218, 3.51, 54),
	(12128, 'Pýta sa Jožko pani učiteľky:\r\n- Pani učiteľka, je správne, aby som bol potrestaný za niečo, čo som vôbec neurobil?\r\n- Nie, Jožko, vôbec nie.\r\n- To mám šťastie, lebo ja som si neurobil domácu úlohu.', 215, 3.13, 54),
	(12129, 'Učiteľka hudobnej výchovy sa pýta Janka: \r\n- Janko, aké poznáš bicie nástroje?\r\n- Remeň môjho otca.', 109, 2.89, 54),
	(12130, '- Oci, dnes sme sa učili, ako sa robia deti... chceš, porozprávam ti...\r\n- No povedz...\r\n- Tak vedel som, že chlapci majú pipíka, ale to, že dievčatá majú POCHVALU, to som netušil!', 191, 3.64, 54),
	(12131, '- Deti, máme hodinu cudzieho jazyka. Prosím, dajte sa do dvojíc.', 67, 2.73, 54),
	(12132, 'Deti na školskom výlete, pani učiteľka im hovorí:\r\n- Deti, vidíte tu čiaru? Vpravo od tejto čiary bývajú dievčatá, vľavo od tejto čiary bývajú chlapci. Kto prekročí túto čiaru, dostane pokutu 10 Sk.\r\nVtom sa ozve Janko a pýta sa: \r\n- Pani učiteľka, koľko stojí permanentka?', 298, 2.96, 54),
	(12133, 'ŠKOLA HROU:\r\n1. Skúška je od slova "skúsiť"\r\n2. Ak ovládaš čo i len 10% otázok, vždy máš väščiu šancu, než že tvoj syn bude homosexuál.\r\n3. Mágia je na strane malých čísiel: potiahneš si tú jedinú otázku, ktorú si sa a)naučil alebo b)nenaučil. Preto je múdrejšie naučiť sa zo sto otázok jednu, než 99.\r\n4. Ak máš len matné spomienky, vystupuj sebaisto.\r\n5. Ak si nepamätáš vôbec nič, vystupuj bohorovne.\r\n6. Ohľadom termínu skúšky: Čo môžeš preložiť dnes, neprekladaj zajtra!\r\n7. Ak si už na skúške a predchádzajúci piati otázky rovno zložili, choď smelo dnu. Skúšajúci bude deprimovaný a dá ti to, bez ohľadu na to, čo povieš...\r\n8. ...veď čo vieš, možno sa aj trafíš ...\r\n9. ...alebo možno ocení aspoň tvoju drzosť.\r\n10. Ak už ideš na skúšku a nič nevieš, nezúfaj. Ešte vždy je tu šanca. Na slovensku je vysoká dopravná nehodovosť a skúšajúci celkom určite nenocoval na fakulte.', 977, 3.24, 54),
	(12134, 'Na hodine matematiky učiteľka vysvetľuje žiakom:\r\n- Kocka je štvorec, čiže obdĺžnik špeciálnej triedy.', 113, 2.99, 54),
	(12135, 'Cez prestávku sa hádajú dvaja žiaci:\r\n- Ty si somár!\r\n- A ty si ešte vačší!\r\nVtom príde učiteľ a zamieša sa do hádky:\r\n- Zrejme ste zabudli, že som tu ešte aj ja!', 178, 3.02, 54),
	(12136, 'Priamy dôkaz:\r\nČím viac pijem, tým dlhšie ostanem v krčme. Čím dlhšie ostanem v krčme, tým neskôr prídem domov. Čím neskôr prídem domov, tým kratšie spím. Čím kratšie spím, tým som viac unavený. Čím viac som unavený, tým sa mi viac trasú ruky. Čím sa mi viac trasú ruky, tým viac porozlievam. Čím viac porozlievam, tým menej pijem. \r\nZ toho vyplýva: ČÍM VIAC PIJEM, TÝM MENEJ PIJEM.', 424, 3.19, 54),
	(12137, 'Profesor sa pýta žiaka: \r\n- Sprechen sie deutsch?\r\nŽiak odpovie:\r\n- Tak trochen.', 83, 3.33, 54),
	(12138, 'Pýtajú sa študenta: \r\n- Ako bolo na skúške?\r\n- Pobožne.\r\nNerozumejú. \r\n- No, profesor v čiernom, ja v čiernom, profesor mi dáva otázku, ja sa prežehnávam, ja odpoviem, profesor sa prežehnáva.', 206, 3.41, 54),
	(12139, 'Malý Jožko dostal poznámku.\r\n- Váš syn nevedel, kto rozbil atóm.\r\nOtec rozčúlený dopísal:\r\n- Kto ho rozbil, ten ho rozbil ale ja to platiť nebudem!', 158, 3.22, 54),
	(12140, 'Jožko dostane úlohu aby stokrát napísal \'Nebudem tikať pani učiteľke\'.\r\nNa druhý deň prišiel do školy a pani učiteľka sa ho pýta.\r\n- Jožko, prečo si to napísal dvestokrát a nie stokrát?\r\n- Aby som ti urobil radosť.', 234, 3.03, 54),
	(12141, 'V škole pre mentálne postihnutých usporiadajú diskotéku. Na konci diskotéky vyhlásia najlepšieho tanečníka - parketového leva. Vyhral Jožko. Po súťaži sa ho pýtajú:\r\n- Ako sa ti to podarilo? \r\nJožko sám prekvapený z víťazstva odpovedá: \r\n- Ja neviem, ja som si išiel len po čaj.  ', 305, 3.06, 54),
	(12142, 'Učiteľka kričí na hodine literatúry na žiaka: \r\n- Laco, nebav sa! Okamžite vstaň a vymysli nejaky rým.  \r\nLaco sa zamyslí a hovorí: \r\n- Kúpali sa chlapci z Rajca, voda im siahala až po kolená. \r\n- To sa nerýmuje! \r\n- To sa bude rýmovať, až stúpne voda.', 271, 3.17, 54),
	(12143, 'Učiteľka sa pýta žiakov na slovenčine: \r\n- Žiaci, som pekná. Aký je to čas? \r\n- Minulý! ', 98, 3.32, 54),
	(12144, '- Kam zaraďujeme ježa?\r\n- Prosím, medzi ihličnaté zvieratá.', 65, 3.12, 54),
	(12145, 'Na hodine slovenčiny pani učiteľka káže deťom tvoriť vety tak, aby sa v nich vyskytlo dva krát slovo pekne.\r\nPrihlási sa Marienka: \r\n- Keď bude pekne, zbalíme si veci a pôjdeme sa pekne kúpať.\r\n- Výborne - hovorí pani učiteľka.\r\nPrihlási sa Janko: \r\n- Viem sa pekne obliecť i pekne obuť.\r\n- No výborne - hovorí učiteľka.\r\nPrihlási sa Dežko: \r\n- Raz v noci, keď sme spali, počuli sme, ako sa rozbilo sklo na dverách. Tatko zažol svetlo a v tom skle, celá ozvracaná leží mama a tatko hovorí: "Pekne, pekne".', 541, 3.02, 54),
	(12146, 'Na hodine Slovenčiny:\r\n- Janko povedz dve zámena.\r\n- Kto, ja?\r\n- Výborne, máš jednotku.', 92, 3.22, 54),
	(12147, 'Na hodine Slovenčiny:\r\n- Janko, povedz nadávku.\r\n- Zase ja do riti!', 69, 3.1, 54),
	(12148, 'Janko príde domov a mama sa ho pýta:\r\n"Ako bolo prvý ďeň v škole?" \r\n"Je to podvod. Na dverách je napísané 1.trieda a vnútri samé drevené lavice."', 158, 3.27, 54),
	(12149, 'Príde malý Ferko zo školy domov a hovorí:\r\n- Dostal som tri päťky.\r\n- A z čoho?\r\n- Z ničoho nič!', 105, 3.27, 54),
	(12150, 'V pomocnej škole sa učia počítať:\r\n"Koľko je 4 krát 4?"\r\nHlási sa Janko:\r\n"Utorok...."\r\nHlási sa Ferko:\r\n"1000"\r\nHlási sa Dežko:\r\n"16"\r\n"A ako si to vypočítal?"\r\n"No predsa utorok deleno tisíc!"', 208, 3.43, 54),
	(12151, 'Na hodine Angličtiny:\r\n"Ako sa píše ,Dojčland,?"', 52, 2.91, 54),
	(12152, 'Po zavedení nového školského systému na Slovensku sa po dlhšom čase stretnú dvaja študenti. Jeden je finančne na dne, zoslabnutý, hladný. Ten druhý prekypuje zdravím a dobrou náladou. \r\n- Ako to robíš? Ja si dovolím akurát tak rožky s čajom - sťažuje sa ten hladný. \r\n- Musíš byť vynaliezavý, ak chceš prežiť. Pozri, ja som si zaobstaral goriliu kožušinu, každé ráno sa prepašujem do zoo, ľudia mi celý deň hádžu dobroty, sem-tam aj peniaze, to by si neveril... Večer sa zahrám na mŕtveho, vyhodia ma von a ja sa celú noc zabávam, samé žúry a baby...\r\n- Hmmm, požičaj ju aj mne na týždeň.\r\nStalo sa a novej "gorile" sa naozaj darilo. Každý deň kopa žrádla, ovocia, sem-tam peniaze, v noci žúry, baby... Až raz večer to zriadencov zoo prestalo baviť a hodili mŕtvu gorilu levovi do klietky. Však ráno sa aj tak zjaví ďalšia. \r\n- To je môj koniec! - trasie sa študent od strachu. Avšak lev podíde k nemu, dlho ho oňucháva, pozerá sa naň a keď zriadenci odídu hovorí:\r\n- Počuj kamoš, nemáš náhodou cigaretu?', 1091, 3.4, 54),
	(12153, 'V slovenskej škole majú nového českého študenta. Na hodine angličtiny sa učiteľka pýta:\r\n- Žiaci, čo ste robili cez prázdniny?\r\nNový študent sa prihlási a vraví:\r\n- Ja jsem s tátou honil kočky.\r\n- A teraz to povedz po anglicky.\r\n- I was masturbating babes with my dady.', 288, 3.3, 54),
	(12154, 'Ako privítajú starší študenti Fakulty Matematiky a Fyziky na beánii mladých prvákov?\r\nPustia im pesničku: "Vitaj náš ďalší hranatý bráško!"', 156, 3.08, 54),
	(12155, 'Hodina v deviatke na ZŠ. Učiteľka vysvetľuje, všetci žiaci ju majú na háku. Hodina skončí, učiteľka hovorí:\r\n- Vidím, že ma nepočúvate, že všetko viete, tak si dáme zajtra písomku. Ospravedlnení sú len tí, ktorí budú mať ťažký úraz, alebo smrť člena rodiny.\r\nPrihlási sa vtipálek triedy:\r\n- A keď budem sexuálne vyčerpaný?\r\n- Tak budeš písať druhou rukou.', 397, 3.53, 54),
	(12156, 'V škole:\r\n- Jožko, videl si už ďatla?\r\n- Áno, v telke.\r\n- A v lese ešte nie?\r\n- Nie, prosím, my telku do lesa nenosíme.', 127, 2.79, 54),
	(12157, 'Jožko príde zo školy a hovorí otcovi, že dostal päťku z matematiky. \r\n– Ako to? – pýta sa podráždene otec. \r\n– No, najskôr sa ma učiteľka spýtala, koľko je 3x2. Odpovedal som, že šesť – hovorí Jožko. \r\n– No veď to je správne!\r\n– A potom sa ma spýtala koľko je 2x3.\r\n– Aký je v tom kurva rozdiel? – rozčuľuje sa otec. \r\n– Presne to som jej povedal.', 392, 3.2, 54),
	(12158, 'Uciteľka v škole sa pýta svojich žiakov, čo zbierajú. \r\nAnička hovorí:\r\n"Ja zbieram servítky. Mám ich 72 a každú s iným obrázkom."\r\nUčiteľka hovorí:\r\n"No, Anička, to je veľmi pekné. Len v tom pokračuj."\r\nPrihlási sa Peter a hovorí:\r\n"Ja zbieram odznaky. Ocko mi urobil takú stenu, kam si ich dávam. Mám ich už 180."\r\nUčiteľka sa poteší:\r\n"No, Peťko, to je veľmi pekné, že ti ocko pomáha. A ty Janko? Ty čo zbieraš?"\r\nJanko sa zahľadí a hovorí:\r\n"Ja zbieram myšlienkové pochody?"\r\nUčiteľka nechápe:\r\n"Ale no tak, prosím ťa, čo je to za hlúposť?"\r\nJanko sa obhajuje:\r\n"Dokážem vám to pani učiteľka. Pozrite sa, vydíte v parku tie dve dámy s nanukmi? Čo myslíte, ktorá z nich je vydatá? Tá, ktorá ho hryzie alebo tá, ktorá ho líže?"\r\nUčiteľka sa zamyslí a hovorí:\r\n"No, Janko, ja myslím, ze asi tá, čo ho líže..."\r\nJanko: \r\n"Ja si myslím, že tá, ktorá má obrúčku, ale je to veľmi zaujimavý myšlienkový pochod!"', 995, 3.5, 54),
	(12159, 'Pýta sa učiteľ fyziky žiakov:\r\n- Čo je teória relativity?\r\nAsi po 20-minútovom rozmýšľaní sa prihlási Móricko\r\n- Teória relativity sa dá vysvetliť troma slovami: VŠETKO JE RELATÍVNE. Príklad: Dajte mi nos do riti. Vy máte nos v riti, ja mám nos v riti, ale relatívne som na tom lepšie ja!!! ', 314, 3.57, 54),
	(12160, '- Čo by som dal za to, keby bol Paríž hlavným mestom Talianska... - hundre si celé poobedie Jožko.\r\n- A prečo Jožko? - nedá to jeho matke.\r\n- Lebo tak som to dnes napísal v písomke.', 192, 3.04, 54),
	(12161, 'Na hodine deti píšu sloh. Janko príde k učiteľke a hovorí:\r\n- Súdružka učiteľka, ja by som sa s vami strašne chcel pomilovať.\r\nUčiteľka ho odvedie do riaditeľne, tam mu dá facku a povie:\r\n- To máš za tu súdružku. A teraz poď, ty nedočkavec.', 262, 3.89, 54),
	(12162, 'Poznámka v žiackej knižke: \r\n"Vošiel som do triedy a nepostavil sa mi!"', 75, 2.87, 54),
	(12163, 'Na hodine logiky sa Jožko uprdol tak, že celá trieda pomaly omdlela. Učiteľka neváha a okamžite ho vyhodí z triedy. Na chodbe si Jožko neodpustí poznámku:\r\n- Jebem ja takú logiku...\r\nNáhodou okolo ide riaditeľ a počuje ho.\r\n- Čo je Jožko, nie si spokojný s hodinou logiky?\r\n- No, mňa vyhnali na čistý vzduch a ostatní zostali dýchať ten smrad...', 369, 3.45, 54),
	(12164, 'Učiteľka sa pýta detí v škole:\r\n- Deti, čo to tam visí za vtáka?\r\nPrihlási se Janíček a hovorí:\r\n- Prosím, za vtáka tam visí netopier!', 149, 3.22, 54),
	(12165, '- Janko, čo ste sa dnes v škole učili?\r\n- O sexe.\r\n- A vedel si?\r\n- Áno.\r\n- A čo si dostal?\r\n- Facku!', 106, 3.43, 54),
	(12166, 'Učiteľka dala žiakom za úlohu zistiť, ako sa narodili. Jožko prišiel domov a pýta sa mamičky: \r\n- Mamička, ako som sa narodil?\r\nA mamička vraví: \r\n- Doniesol ťa bocian, Jožko.\r\nRáno išiel do školy a na streche zbadal bociana. Vyšplhal sa na strechu a dal si bociana do tašky.  Učiteľka sa ho v škole spýtala. \r\n- Tak, Jožko, už vieš, ako si sa narodil?  \r\nJožko hovorí: \r\n- No jasné, mám ho vytiahnuť? \r\n- Nie, nie!!! Nemusíš, máš jednotku!', 475, 3.64, 54),
	(12167, 'V škole sa pani učiteľka pýta žiakov:\r\n- Deti, čo to tam visí za vtáčika?\r\nMalý Jurko sa prihlási a povie:\r\n- To je netopier a visí za nožičky, nie za vtáčika.', 175, 3.17, 54),
	(12168, 'Učiteľ:\r\n-Kto si myslí, že je hlúpy, nech sa postaví.\r\nPo chvíli váhania sa postaví Dežko.\r\n-Ty si myslíš, že si hlúpy, Dežo?\r\n-Nie, pán učiteľ, ale mi bolo také blbé, že vy stojíte sám.              ', 223, 4.11, 54),
	(12169, 'Pri písomke pošepkal Jano svojmu susedovi:\r\n"Ten učiteľ je ale idiot!"\r\nA od tabule sa ozvalo:\r\n"Nenapovedať! Každý na to musí prísť sám."              ', 163, 3, 54),
	(12170, '"Prečo môj syn dostal zo zemepisu päťku?"\r\n"Lebo hľadal Rimavskú Sobotu v kalendári!"              ', 106, 3.44, 54),
	(12171, 'V škole sa pýtajú maďarského chlapčeka. Lászlo povedz nám čo je korytnačka. \r\n- Taký veľký opancierovaný žaba, neskáče, len plazí zem.              ', 166, 4, 54),
	(12172, 'Učiteľka hovori žiakom: \r\n- Zajtra si vymaľujeme triedu, každý chlapec nech si donesie štetku.              ', 115, 3.52, 54),
	(12173, 'Učiteľ kára žiačku:\r\n- Marika, prečo si si neurobila domácu úlohu?\r\n- Vypadol elektrický prúd.\r\n- A čo si robila potme?\r\n- Pozerala som televíziu.\r\n- Bez prúdu?\r\n- Zapálili sme si sviečky.              ', 217, 4.05, 54),
	(12174, 'Deti majú telesnú a skáču cez kozu. Janko skočí a zloží sa na zem.\r\nPani učiteľka sa ho pýta, čo sa stalo. Janko zakvíli:\r\n"Mám výron."\r\n"Tak sa utri a vstávaj."              ', 191, 4.05, 54),
	(12175, 'Na chémií:,,Metán je výbušný plyn,ktorý vybuchuje,keď príde do styku so vzduchom.Nachádza sa v črevách." \r\nŽiaci:,,Poďme si všetci prdnúť, možno nám vybuchne škola!"              ', 199, 4.21, 54),
	(12176, '- Ako to,\r\n- Rozčuluje sa otec.\r\n- že si neurobil tie prijimacie pohovori?! veď si vopred vedel všetky otázky! \r\n- Otázky som vedel ale odpovede nie.              ', 169, 3.83, 54),
	(12177, 'Študent nevie a tvári sa zúfalo. Kantor ho osloví s otázkou:\r\n"Ako si vlastne predstavujete skúšku na vysokej škole?"\r\nŠtudent: "Ako rozhovor dvoch inteligentov."\r\nKantor: "No hej, ale čo keď jeden z tých dvoch nie je inteligent, ale naprostý vôl?"\r\nŠtudent: "No, v tom prípade inteligent berie index a odchádza."              ', 344, 3.53, 54),
	(12178, 'Sedia raz vyhladovaní študenti na internáte a fantazírujú:\r\n"Čo takto začať chovať prasa?" \r\n"Ti hrabe, nie? Čo tá špina? A ten smrad?"\r\n"Si zvykne..."              ', 177, 3.96, 54),
	(12179, 'Učiteľ sa pýta žiaka v škole: \n”Janko, čím by si chcel byť?”\n”Hracím automatom.”\n”A prečo?”\n”Pretože nič nerobí, iba berie peniaze.”              ', 175, 3.92, 54),
	(12180, '-Pani učitelka,môzem byt potrestany za to,co som neurobil?\n-Nie,janko,to nie.\n-Tak sa priznám,neurobil som si domácu úlohu.              ', 142, 3.82, 54),
	(12181, 'Učiteľ sa pýta žiakov či vedia aké je číslo lásky? Prihlási sa malý Peťko a povie: 21 593.\n- A na to si už ako prišiel?\n- Jednoducho, pretože ak sa 2 rozhodnú stať jedným v priebehu 5 týždňoch zistia či o 9 mesiacov budú traja.              ', 264, 3.36, 54),
	(12182, 'Sedia tri ženy na lavičke. Jedna je šibnutá, druhá je škaredá a tretia...je tiež učiteľka.              ', 114, 4.15, 54),
	(12183, 'Pani učiteľka vraví v triede:\r\n"Deti, kto si myslí, že je hlúpy, nech sa postaví."\r\nDlho sa nič nedeje, až sa nakoniec postaví Jožko.\r\n"Jožko, ty si myslíš, že si hlúpy?" pýta sa pani učiteľka.\r\n"Nie, len sa mi zdalo hlúpe, že stojíte sama."\n', 264, 3.75, 54),
	(12184, 'Učiteľka sa pýta žiaka:\r\n”Miško, čo sú to múmie?”\r\n”Sušení Egypťania!”              ', 103, 3.18, 54),
	(12185, 'Pri písomke pošepkal Jano svojmu susedovi:\r\n”Ty počúvaj, ten náš učiteľ je ale riadny debil.”\r\nA od tabule sa ozvalo:\r\n”Nenapovedať! Každý na to musí prísť sám.”              ', 198, 3.83, 54),
	(12186, 'Pani učiteľka sa pýta detí:\r\n”Kto mi povie jednoduchú vetu?”\r\nPrihlási sa Janko a hovorí: \r\n”Dievča máva.” \r\n”Dobre, teraz tú vetu rozviň.”\r\n”Dievča máva na vojaka.”\r\n”Dobre, a teraz ju skráť.”\r\n”Štetka.”              ', 258, 4.03, 54),
	(12187, 'Malý Ferko plače pred školou. \r\n- Školník sa ho spýta: "prečo plačeš?". \r\n- Ferko hovorí: "pán riaditeľ spadol do žumpy a napil sa."\r\n- Školník hovorí: "veď ostatní chlapci neplačú". \r\n- Ferko hovorí: "oni to videli a ja nie."                 ', 264, 4.25, 54),
	(12189, 'Pýta sa učiteľka v škole Dežka:\r\n”Ktoré je najrýchlejšie zviera na svete?”\r\n”Gepard.”\r\n”Správne Dežko. A ktorý vták je najrýchlejší na svete?”\r\n”Ta gepardov, ne?”              ', 207, 4.19, 54),
	(12190, 'O štvrtej ráno zvoní profesorovi doma telefón. Rozospatý profesor to zdvihne a vraví:\r\n”Haló?”\r\nA zo slúchadla sa ozve:\r\n”Spíš?”\r\n”Spím...”\r\n”No vidíš, a my sa ešte učíme!!!”              ', 220, 4.18, 54),
	(12191, 'Učiteľ nemčiny hovorí:\r\n”Ak si slovo zopakujete 3 krát, tak bude vaše.”\r\nZ poslednej lavice sa ozve dievčenský hlas:\r\n”Fero! Fero! Fero!” \n', 155, 3.95, 54),
	(12192, 'Nová učiteľka zoológie sa na hodine pýta Móricka:\r\n”Chlapče, od akého vtáka je toto vajce?”\r\n”Neviem.”\r\n”A toto?”\r\n”Neviem.”\r\n”A toto?”\r\n”Takisto neviem.”\r\n”Zle, veľmi zle, ako sa voláš?”\r\nMóricko si stiahne trenírky a hovorí:\r\n”Skúste uhádnuť podľa vajec!”              ', 322, 4.21, 54),
	(12193, 'Cez prestávku sa hádajú dvaja žiaci:\r\n”Ty si somár!”\r\n”A ty si ešte vačší!”\r\nVtom príde učiteľ a zamieša sa do hádky:\r\n”Zrejme ste zabudli, že som tu ešte aj ja!”\n', 191, 3.59, 54),
	(12194, '”Lukáš, čo si nakreslil?”\r\n”Kravu, ktorá žerie trávu a ďatelinu.”\r\n”A kde je ta tráva a ďatelina?” pýta sa pani učiteľka.\r\n”Krava ju zožrala.”\r\n”A kde je tá krava?”\r\n”Odišla, lebo už všetko zožrala.”              ', 255, 4.07, 54),
	(12195, 'Učiteľ hovorí žiakovi:"Ako ti mám vysvetliť že slovo"neni" neni spisovné!              ', 95, 4.07, 54),
	(12196, 'Na hodine pani učiteľka vraví:\r\n”No deti, povedzte mi nejaké zvieratko na P.”\r\nPrihlási sa Anička: ”Papagáj.”\r\nHlási sa Dežko: ”Patkaň.”\r\n”No deti a teraz na D.” vraví učiteľka.\r\nAnička: ”Dikobraz.”\r\nDežko: ”Dva patkane.”\r\n”A teraz na Ž.”\r\nAnička: ”Žabka.”\r\n”Áno Anička.” chváli ju pani učiteľka.\r\nDežko: ”Žeby tri patkane...?”              ', 406, 3.5, 54),
	(12197, 'Na hodine matematiky:\r\n”Koľko je 5+5?”\r\n”12.30 s DPH.”              ', 77, 3.6, 54),
	(12198, 'V škole na hodine dejepisu sa učia žiaci o slávnych ľuďoch. Učiteľka sa pýta:\r\n”Miško, čím sa preslávil Krištof Kolumbus?”\r\n”Dostal sa do Ameriky bez víz.” odpovedá Miško.\n', 197, 3.29, 54),
	(12199, 'V škole sa pani učiteľka pýta Janka:\r\n”Janko, máš domácu úlohu?”\r\n”Ta ne!”\r\n”Odpovedaj celou vetou!”\r\n”Ta nemám.”              ', 152, 3.86, 54),
	(12200, 'Učiteľ sa pýta na hodine fyziky:\r\n”Povedz mi, Ferko, aká je najnovšia\r\na najosvedčenejšia hnacia sila?”\r\n”Protekcia, pán učiteľ.”              ', 161, 3.73, 54),
	(12201, 'Janko sa pýta učiteľky na zemepise:\r\n”Pani učiteľka môžem ísť na WC?”\r\n”Až keď mi vymenuješ svetové strany.”\r\n”Východ. Záchod. Serem. Juj!”              ', 180, 3.63, 54),
	(12202, 'Otec sa pýta syna, ktorý sa práve vrátil\r\nz maturity, ako bolo.\r\n”Vieš, oci, celá maturita prebiehala pobožne.”\r\n”A to akože ako?”\r\n”To vieš, skúšajúci bol v čiernom, ja som bol v čiernom. On položil otázku, ja som sa prežehnal. Ja som odpovedal, on sa prežehnal.”              ', 308, 4.21, 54),
	(12203, 'Príde učiteľka do triedy a hovorí:\r\n”Žiaci, dnes budeme počítať s kalkulačkami.”\r\nDeti sú celé šťastné a učiteľka pokračuje:\r\n”Takže, koľko je 5 kalkulačiek mínus\r\n3 kalkulačky?”              ', 222, 4.14, 54),
	(12204, 'Dvaja hladní študenti fantazírujú:\r\n”Až budeme mať za čo, kúpime si peceň chleba a budeme jesť! Ja si odhryznem, ty si odhryzneš, ja si odhryznem, ty si odhryzneš, ja si odhryznem, ja si odhryznem, ty si odhryzneš.”\r\nPlesk! Ozvala sa rana poza uši.\r\n”Za čo?”\r\n”Za to, že si si dva razy za sebou odhryzol.”              ', 347, 4.16, 54),
	(12205, 'Pýta sa Jožko pani učiteľky:\r\n”Pani učiteľka, je správne, aby som bol potrestaný za niečo, čo som vôbec neurobil?”\r\n”Nie, Jožko, vôbec nie.”\r\n”To mám šťastie, lebo ja som si neurobil domácu úlohu.”              ', 241, 4.08, 54),
	(12206, 'Profesor sa pýta žiaka:\r\n”Sprechen sie deutsch?”\r\nŽiak odpovie:\r\n”Tak trochen.”              ', 104, 4, 54),
	(12207, 'Dežo sedí v škole na hodine a rozmýšľa:\r\n”Čo mám robiť? Žeby som prestal fajčiť? Alebo žeby som prestal chľastať? Alebo mám prestať sexovať s Araňou? Alebo by som sa mal vykašlať na marihuanu?”\r\nVtom k nemu pristúpi učiteľka a pýta sa:\r\n”Dežo, koľko je dva krát dva?”\r\n”Teda, pani učiteľka, mať tak vaše problémy.”              ', 373, 4.14, 54),
	(12208, 'Mesiac pred začiatkom skúškového obdobia sa pýta Boh svätého Petra:\r\n- Ako to vyzerá s našimi študentmi na zemi?\r\nSv. Peter vraví:\r\n- No, filozofi a medici sa už začínajú učiť. Ekonómovia a právnici pijú.\r\nTýždeň pred skúškou sa Boh opäť pýta, ako to vyzerá. Sv. Peter hovorí:\r\n- Filozofi a medici si už začínajú opakovať, ekonómovia sa začali učiť a právnici pijú.\r\nDeň pred skúškou sa pýta Boh opäť to isté. Sv. Peter pozerá na zem a hovorí:\r\n- Filozofi a medici to už vedia odpredu aj odzadu, ekonómovia to len tak-tak dočítali a právnici sa modlia.\r\nBoh sa zamyslí a vraví:\r\n- Čo? Právnici sa modlia? No, tak to im pomôžeme, nie?              ', 708, 4.21, 54),
	(12209, 'Niekde na východnom Slovensku sa učiteľka pýta žiakov:\r\n- Dzeci, znace co toto za zver?\r\n- Ta to topier. - hovorí Dežko.\r\n- Dežko, to ne topier, to netopier. - opravuje ho učiteľka.\r\n- Ta ak to ne topier, ta ja už neznam, co by to mohlo byc.              ', 266, 3.5, 54),
	(12210, 'Istý študent na skúške odpovedal tak zle, že profesor sa od zlosti triasol a v takej nálade mu do indexu napísal “somár”. Študent vyšiel z kabinetu, pozrel sa do indexu a vrátil sa za profesorom.\r\n- Pán profesor, zabudli ste mi napísať známku.\r\n- Veď som vám hodnotenie napísal.\r\n- Nie, iba ste sa podpísali.              ', 345, 3.91, 54),
	(12211, 'V škole:\r\n- Anička, vyhláskuj mi slovo DUB!\r\n- Nó, tak DUB to je Dé, Ú, Bé.\r\n- Dobre, teraz ty, Jožko, vyhláskuj mi slovo PES.\r\n- PES, to je Pé, É, Es.\r\n- Výborne Jožko. A teraz mi ty, Muhammad, vyhláskuj RASOVÁ DISKRIMINÁCIA.              ', 256, 4.11, 54),
	(12212, 'Pani učiteľka hovorí deťom:\r\n- Deti, dám vám hádanku. Je to lesné zviera a keď do názvu doplníte písmeno “d“, vznikne z toho časť tela. Čo je to?\r\nDlho nikto neodpovedá, a tak sa učiteľka rozhodne, že im to prezradí:\r\n- No predsa laň. A keď pridáme “d“, vznikne z toho dlaň.\r\nNa to Móricko pošepká spolužiakovi:\r\n- Hneď som si myslel, že kuna to nebude\n', 391, 4.17, 54),
	(12213, '- P-pán p-prof-fesor, m-môže šššš-tudent r-robiť \r\ns-s-skúšku k-keď je opi-opitý ?\r\n- Nooo, v podstate môže ... \r\n- Cha-chalani, d-doneste ho!              ', 170, 4.12, 54),
	(12214, '- Móricko, kde máš žiacku knižku?\r\n- Požičal som ju Marienke, chcela vystrašiť rodičov.\n', 98, 4.04, 54),
	(12215, '- Máte veľmi pekné zuby, pani učiteľka!\r\nNová učiteľka sa polichotene usmieva: \r\n- To mám po mojej mamičke.\r\n- A boli vám dobré?              ', 154, 4.1, 54),
	(12216, '- Pán policajt, pán policajt! Rýchlo!\r\nPaľko ťahá policajta za rukáv.\r\n- Tam... za rohom … náš učiteľ biológie.\r\n- Stalo sa mu niečo?\r\n- Nie zle zaparkoval.              ', 185, 4.21, 54),
	(12217, '- Prečo mat-fyzáci nosia kockované košele?\r\n- Keď ich má žena poškrabkať, stačí ak zadajú súradnice.              ', 127, 4.17, 54),
	(12218, 'Príde dcéra domov zo školy a v žiackej knižke má poznámku:\r\n- Je drzá a neustále vyrušuje.\r\nDruhý deň príde do školy a dáva prečítať učiteľke odpoveď:\r\n- To má po matke. Zmlátil som ich obe. Otec.\n', 220, 4.21, 54),
	(12219, 'V škole: \r\n„Čo je s tým králikom, čo mi ho chcel ocko poslať?" \r\n„Ja neviem, pani učiteľka, ale on už zase žerie."              ', 142, 3.63, 54),
	(12220, 'Pani učiteľka chce od detí, aby povedali rým. Deti začnú rýmovať, len Jožko mlčí. Pani učiteľka ho vyvolá a on vraví: \r\n„V mori stojí Kokrhel , vodu má až po kolená." \r\n„Ale, Jožko, to sa predsa vôbec nerýmuje." \r\n„Len počkajte, až príde príliv."              ', 292, 3.11, 54),
	(12221, 'Z triedy sa ozýva veľký krik. Riaditeľ rázne vojde dovnútra a zmocní sa mládenca, ktorý najviac kričí. Vyvedie ho na chodbu a v triede nastane ticho. Hrdo sa vráti: \r\n- Kde máte učiteľa?\r\n- Na chodbe...              ', 231, 4.15, 54),
	(12222, 'Na skúške:\r\n- Prišiel som, videl som, nepochopil som, odchádzam.              ', 82, 3.56, 54),
	(12223, '„Synku, nemáš žiadnu domácu úlohu?" pýta sa otec.\r\n„Nie, oci."\r\n„Škoda," smutne povie otec a odpochoduje do kuchyne.\n', 130, 3.6, 54),
	(12224, 'Učiteľka napísala žiakovi do žiackej knižky: \r\n"Smrdí, umývať!!!" \r\nOtec odpísal: \r\n"Učiť, nečuchať!!!"\n', 118, 4, 54),
	(12225, 'Študent ťahá na internát kravu. Vrátnik ho zastaví: \r\n- Kam s tou kravou? \r\n- Viete, mám rád mlieko, tak si ju budem chovať a dojiť. \r\n- A čo ten smrad a neporiadok? \r\n- Hádam si postupne zvykne.              ', 221, 3.5, 54),
	(12226, 'Pri príležitosti otvorenia nového školského roka reční v škótskej škole riaditeľ: \r\n„Deti moje, toto nie je moja škola, nie je ani vaša, ale je naša!" \r\nTenučký hlások zo zadnej lavice: \r\n„Tak ju predajme."              ', 241, 4, 54),
	(12227, '„Žiak Mrkvička, aké druhy vtákov poznáš?"\r\n„Prosím, sú to dravé vtáky, ako napríklad orol, a sravé, ako napríklad holub.              ', 151, 3.5, 54),
	(12228, '"Prečo si nebol včera v škole?" pýta sa učiteľka žiaka. \r\n"Musel som odviesť kravu k býkovi." \r\n"A to nemohol urobiť tvoj otec?" \r\n"Nie! To musel urobiť býk."              ', 184, 3.5, 54),
	(12229, 'Príde malá Anička domov zo školy a otec sa jej pýta. \r\n„Čo bolo v škole?" \r\n„Ale nič, len som dostala štvorku zo zemepisu - nemohla som nájsť Aljašku..." \r\n„A nenechala si si ju v izbe?"               ', 219, 3.56, 54),
	(12230, 'Jožko vbehne do triedy 5 minút po zazvonení bez klopania. Pani učiteľka mu hovorí: \r\n- Jožko, pekne sa vráť za dvere ešte raz, ale tak, ako by vošiel napríklad tvoj ocko. Jožko výjde, za chvíľu rozkope dvere, vrazí do triedy a zreve: \r\n- Tak čo vy svine! Nečakali ste ma, čo?!              ', 310, 3.91, 54),
	(12231, 'Móricko píše test na hodine prírodopisu a dopisuje: \r\n- Kravička sa: otelila. Mačka sa: okotila. Kobyla sa: ožrebila. \r\nŽralok sa: ožral.              ', 160, 3.64, 54),
	(12232, 'Pán Novák sa spytuje svojho syna.\r\n- No tak, Paľko, ako stojíš v škole?\r\n- Celkom dobre, otec. Každý deň v inom kúte.              ', 141, 4.15, 54),
	(12233, 'Učiteľka na hodine prírodopisu vysvetľuje žiakom:\r\n- Pštros, je taká veľká sliepka, no, asi taká, ako ja ...              ', 132, 4.13, 54),
	(12234, 'Učiteľ vraví deťom: „Vonku je osemnásť stupňov, ja vážim 75 kg, koľko mám rokov?"\r\nDeti naňho pozerajú s otvorenou pusou, až sa po chvíli ozve Lojzko: „Štyridsaťosem."\r\n„Prečo si to myslíš?"\r\n„Pretože mám brata, ktorý má 24 a otec mu stále vraví, že je polovičný debil..."              ', 323, 3.62, 54),
	(12235, 'Tak deti, dnes sa budeme fotiť. Pekne sa na fotke usmievajte, to bude taká pamiatka. A keď za desať rokov vezmete tú fotku do rúk, pozriete sa na ňu, tak poviete: \r\n„Tak toto je Janko, ten je dnes inžinier, toto je Marienka, ta má už tri deti a peknú rodinku..." \r\nA zo zadnej lavice sa ozve: "A toto bola naša učiteľka a tá je už dnes mŕtva."              ', 376, 3.75, 54),
	(12236, 'Vzdychne si študent pred skúškou:\r\n- Ach, keby sme tak boli na Mesiaci.\r\n- A to už prečo? - pýta sa ho priateľ.\r\n- Lebo na Mesiaci je všetko 6-krát ľahšie.\n', 167, 3.64, 54),
	(12237, 'Učiteľ sa pýta žiakov v triede:\r\n- Kto sa pokladá za blbca, nech vstane.\r\nPo dlhšej pauze vstane jeden žiak.\r\n- Čo, ty sa považuješ za blbca?\r\n- To ani nie. Ale sa mi zdá hlúpe, že stojíte sám.              ', 222, 4.04, 54),
	(12238, 'Prváci sú prvýkrát v škole a pani učiteľka sa pýta:\r\n"Deti, kto z vás vie koľko je 1 + 2?"\r\nNikto nič nehovorí.\r\n"Nemusíte sa hanbiť prihlásiť sa."\r\n"Naozaj to nikto nevie?"\r\nPrihlási sa malé dievčatko:\r\n"Ja neviem koľko je 1 + 2, ale viem, že je to určite to isté ako 2 + 1, pretože sčítanie reálnych čísel je  komutatívne."\n', 356, 3.93, 54),
	(12239, 'Učiteľ žiakovi:\r\n"Keby si mal sedem jabĺčok a ja by som ťa o dve poprosil, koľko by ti ich zostalo?"\r\n"Sedem!"\n', 118, 3.58, 54),
	(12240, '"Nie, pani učiteľka, neviem kto to urobil a v tej chvíli mi to pripadalo ako dobrý nápad."\n', 96, 3.6, 54),
	(12241, 'Profesor hovorí:\r\n"Dnes vás pustím o štvrť hodiny skôr. Odchádzajte prosím potichu, nech nezobudíte nikoho vo vedľajších učebniach."\n', 146, 4, 54),
	(12242, '"Jurko, povedz dve zámená."\r\n"Kto, ja?"\r\n"Výborne, Jurko."\n', 62, 3.75, 54),
	(12243, 'Snehulienka a čarodejnica sa bavia na gympli, kam na vysokú. Snehulienka hovorí:\r\n"Ja pôjdem na ekonomickú. Nebudem tam najkrajšia, ale budem tam najmúdrejšia".\r\nA čarodejnica hovorí:\r\n"Ja pôjdem na matfyz. Nebudem tam najmúdrejšia, ale budem najkrajšia".\n', 270, 4.2, 54),
	(12244, 'Starý profesor má na praxi mladú adeptku učiteľskej profesie:\r\n"Temer v každej triede sa nájde decko, ktoré bude chcieť za každú cenu o všetkom diskutovať. Váš prvý krok bude snaha umlčať ho. Ale radím vám, riadne sa nad tým zamyslite, pretože toto decko je pravdepodobne jediné, ktoré vás počúva."\n', 326, 3.14, 54),
	(12245, 'Učiteľka dáva deťom hádanky:\r\n"Má to 4 nohy, hlavu a robí to hau. Čo je to?"\r\n"Nevieme!"\r\n"Pes."\r\n"Hurá pes! "\r\n"Má to 2krát 4 nohy, 2 hlavy a robí to 2krát hau. \r\nČo je to?"\r\n"Nevieme!"\r\n"Dvaja psy."\r\n"Huraaa dvaja psi!"\r\n"Visí to na stene, robí to tik-tak, a keď to spadne, tak je po hodinách. Čo je to?"\r\n"Huraaa TRAJA PSI!"\n', 347, 3.8, 54),
	(12246, 'Učiteľ hudby varuje žiaka:\r\n"Ak ma budeš ďalej takto hnevať, tak nahovorím tvojej matke, že máš veľký talent."\n', 123, 4.05, 54),
	(12247, 'Učiteľka sa pýta detí:\r\n"Deti, čo nám dáva hus?".\r\nPrihlási sa Jožko:\r\n"Škvarky."\r\n"A čo ešte?" pýta sa učiteľka.\r\n"Škvarky."\r\n"To už si hovoril.\r\n Trochu ti pomôžem, čo mávaš pod hlavou keď spíš?"\r\n"Vankúš."\r\n"A čo je vo vankúši?"\r\n"Perie."\r\n"No! Takže čo nám dáva hus, Jožko?"\r\n"Škvarky!"\n', 327, 4.09, 54),
	(12248, '"Počula som, že Váš syn študuje na univerzite. Čo z neho bude, keď skončí?"\r\n"Obávam sa, že dôchodca."\n', 115, 4.23, 54),
	(12249, 'V škole:\r\n"Števko, kto ti pomáhal s domácou úlohou?"\r\n"Nikto."\r\n"Neklam! Kto ti pomáhal s domácou úlohou?"\r\n"Oco."\r\n"Tak mu odkáž, že Wolker bol Jiří a nie Johnnie."\n', 179, 3.89, 54),
	(12250, '"Môžeš mi povedať, ako si dostal trojku z mravov?"\r\n"Fajčil som na záchode."\r\n"To určite, za to som ja dostal dvojku!"\r\n"Hej, ale ty si určite neogrcal učiteľku."\n', 173, 3.33, 54),
	(12251, 'Deti majú v škôlke tvoriť vety, kde sú slová keďže a zjavne.\r\nPrihlási sa Anička:\r\n"Keďže je zamračené, zjavne bude pršať."\r\nPrihlási sa Janko:\r\n"Babička ide po dvore a nesie si Tajmsy."\r\n"No ale tam nie je keďže ani zjavne."\r\n"No, to nie je všetko. Keďže nevie ani slovo po anglicky, zjavne sa ide vysrať."\n', 332, 4.15, 54),
	(12252, '"Študent, môžete mi niečo povedať o Slovenskom národnom povstaní?"\r\n"Pán profesor, neviem nič konkrétne, ale vraj sa niečo chystá."\n', 144, 4.09, 54),
	(12253, 'Na prvej hodine v škole...\r\n- Deti, budem vaša učiteľka, volám sa Marta Baranová a vy?\r\n- My nie...                  ', 123, 4.1, 54),
	(12254, 'Vidíte, deti že socha Slobody v New Yorku drží v jednej ruke fakľu a v druhej knihu. Kto by mi vedel povedať, čo symbolizuje fakľa? Ty, Ferko!\r\nIba to, že v tme sa nedá čítať.                ', 204, 3.95, 54),
	(12255, 'Na hodine matematiky sa učiteľ pýta Móricka:\r\n- Keby si mal sedem cukríkov a ja by som ťa o dva poprosil, koľko by ti zostalo?\r\n- Sedem.              ', 157, 4.02, 54),
	(12256, 'Na hodine biológie dá pani učiteľka úlohu:\r\n- Deti, povedzte nejaké zvieratko, ktorého meno sa začína na P.\r\n- Papagáj, - volá Anička.\r\n- Patkaň, - volá Dežko.\r\n- Výborne, Anička! A teraz nejaké zvieratko na D.\r\n- Dikobraz, - volá Marienka.\r\n- Dva patkane, - volá Dežko.\r\n- Dobre, Marienka! A teraz zvieratko na Ž. Nikto sa nehlási. Až po chvíli Dežko váhavo:\r\n- Žeby tri patkane?              ', 422, 3.78, 54),
	(12257, 'On a ona po vášnivej noci:\r\n- Miluješ ma, miláčik?\r\n- Veľmi, drahá.\r\n- Splníš mi každé moje prianie?\r\n- Áno, splním každé jedno tvoje želanie.\r\n- Tak ma zajtra nevyvolaj z matiky.              ', 209, 4.08, 54),
	(12258, 'Učiteľka v osobitnej škole nakreslila na tabuľu kocku.\r\n”Detičky, čo je to?”\r\n”Nevieeemeee.”\r\n”Deti, toto je kocka. Zopakujte.”\r\n”Kooockaaa.”\r\n”Dobre.”\r\nA prikreslila ešte jednu kocku.\r\n”Deti a čo je toto?”\r\n”Nevieeemeee.”\r\n”Deti, to sú dve kocky. Zopakujte.”\r\n”Dveee kooockyyy.”\r\nUčiteľka po hodine príde na kávu do kabinetu a kolegyňa sa jej pýta:\r\n”Koľko kociek chceš do kávy?”\r\n”Dvee kooockyyy.”\n', 462, 3.88, 54),
	(12259, 'Na prednáške:\r\n”Tak, milí medici, kto z vás mi povie, prečo raz pretrhnutá panenská blana už nikdy nezrastie?” pýta sa profesor.\r\nOdpoveď:\r\n”Pretože na to už nikdy nemá čas!”              ', 210, 3.85, 54),
	(12260, 'Američania chcú vyslať špióna na Slovensko a rozhodnú sa, že najmenej nápadné bude, keď tam bude študovať  na vysokej škole. Prvý adept sa však po týždni vrátil naspäť do Ameriky. - Ako to, že ťa odhalili? pýta sa ho nadriadený. \r\n- No, prišli sme do školy, šli sme na prednášku a všetci tam spali, len ja som si zapisoval a tak ma odhalili. Pošlú tam druhého, ale ten je tiež hneď naspäť. \r\n- Ako to, že ťa odhalili, veď, už si vedel ako na to? pýta sa šéf. \r\n- No, prišli sme na prednášku, všetci spali a ja tiež. Potom sme šli na intrák, všetci chlastali a húlili, ale ja nie, a tak ma odhalili. Američania vyšlú tretieho adepta a ten sa vráti po pol roku. \r\n- Už si tam vydržal tak dlho, tak ako ťa mohli odhaliť? pýta sa šéf. \r\n- No, keď sme boli na prednáškach, tak všetci spali a ja tiež. Keď sme boli na intráku, tak všetci chlastali a húlili a ja tiež. Potom však prišlo skúškové, všetci to spravili, a len mňa vyrazili.              ', 1024, 3.82, 54),
	(12261, 'Deti majú priniesť do školy zvieratká   \r\na ukázať, čo dokážu. Na druhý deň sú všetci postupne prichádzajú pred tabuľu. Jožko ukáže, ako ho jeho psík na slovo počúva, ako si sadne, ľahne, vyskočí... Ďalšia bola Marienka a ukázala, aká je jej mačka hravá, ako sa vie hrať s klbkom vlny... Potom pred tabuľu príde Móricko, z rukáva vytiahne dlhého hada, chytí ho za chvost, zakrúti nad hlavou a z celej sily mu tresne hlavu o katedru. Z hada vylezie malátne "ssssssss". Učiteľka pohrozí Mórickovi poznámkou, veď zvieratká sa takto trýzniť nemôžu. „Moment, pani učiteľka, hneď to bude..." odvrkne Móricko a už aj opakuje celú procedúru s hadom. Z hada vylezie opäť len slabé "ssssssss". Učiteľka už chce volať rodičov, ale Móricko bez váhania opäť hada z celej sily rozkrúti nad hlavou a tresne o kraj lavice. A z hada vylezie: \r\n„Ssssssssssssspievanky, sssspieevanky, kdeže ste sa vzali..."              ', 978, 3.77, 54),
	(12262, '\r\nRiaditeľ jednej menšej strednej školy mal veľké problémy s dospievajúcimi slečnami, ktorým sa zapáčilo používanie rúžov. Keď sa na toaletách maľovali pery, vždy potom zanechávali otlačky na zrkadle. Keď sa už situácia nedala zvládnuť, riaditeľ sa rozhodol razantne zakročiť. Zavolal si všetky dotyčné slečny a odviedol ich na toalety. Tam už čakal školník. Riaditeľ dievčatám vysvetlil, že si asi neuvedomujú, koľko práce školníkovi dá každý večer zrkadlá umyť. Poprosil ho, aby slečnám svoju namáhavú prácu predviedol. Školník vytiahol zo skrine dlhú metlu, namočil ju v najbližšej záchodovej míse a začal čistiť zrkadlo. A bolo po otlačkoch...              ', 730, 4.16, 54),
	(12263, 'Záverečné skúšky na policajnej akadémii. Profesor sa pýta študenta:\r\n- Pred budovou školy stojí biela Fábia. Akú má farbu?\r\n- ??? - nevie študent.\r\n- Zopakujem otázku. Pred budovou školy stojí biele auto. Je to biela Fábia. Akej je farby táto biela Fábia?\r\n- ...žeby bielej? - odpovie po dlhom premýšľaní študent.\r\n- Ešte jedna posledná otázka... Fábia má päť prevodových rýchlostí. Koľko revodových rýchlostí má auto značky Fábia?\r\n- ??? - nevie študent.\r\n- No... zopakujem otázku. Auto značky Fábia s piatimi rýchlosťami, má päť prevodových rýchlostí. Koľko prevodových rýchlostí má auto značky Fábia s piatimi prevodovými rýchlosťami?\r\n- ...žeby bielej? - odpovie po dlhom premýšľaní študent.              ', 780, 4, 54),
	(12264, 'Dvaja mladíci študovali chémiu v Prahe. Celý rok sa im celkom darilo, vyzerali ako vzorní študenti. Víkend pred záverečným testom sa rozhodli, že sa trochu uvoľnia a odišli za kamarátmi na Moravu. Ale trochu to prehnali a prespali celú nedeľu. Do Prahy dorazili v pondelok ráno, úplne neschopní rozumne uvažovať. Popoludní prišli za profesorom a začali mu vysvetľovať, že boli cez víkend preč a keď sa vracali, dostali na kolese defekt a strávili polovicu noci na diaľnici. Márne sa snažili, nikto im nezastavil, takže nestihli včas doraziť do Prahy a nestihli test. Profesor povedal, že môžu napísať test na druhý deň. Na druhý deň profesor posadil každého do inej miestnosti a priniesol im testy. Na prvej strane bola otázka za päť bodov. Obaja ju v pohode zmákli. Ale boli strašne prekvapení, keď otočili papier a tam bolo napísané:\r\n“Otázka za deväťdesiat päť bodov - ktoré to bolo koleso?“\n', 963, 4.29, 54),
	(12265, 'Učiteľka na základnej škole v 2. ročníku sa pýta detí, kde pracujú ich rodičia. Prihlási sa Katka:\r\n- Môj otecko je kuchár.\r\n- Vidíte, deti, keď je niekto hladný, tak Katkin otecko mu navarí....\r\nMiško:\r\n- No, môj otec je požiarník.\r\n- ....a keď niekde horí, Miškov otecko to príde zahasiť... užitočné.\r\nJožko:\r\n- Môj otec robí striptéra v gay klube.\r\nUčiteľka to radšej prejde mlčaním. Potom si zavolá Jožka do kabinetu a hovorí mu:\r\n- Jožko, to si ako myslel s tým striptérom. To vážne?!\r\n- No, pani učiteľka, - nakloni sa k nej Jožko - on v skutočnosti robí programátora v Microsofte, ale my sa za to hanbíme...\n', 668, 4.09, 54),
	(12266, 'Kubko príde neskoro na vyučovanie, vojde do triedy a začne:\r\n- Pani učiteľka, prepáčte, že som meškal, ale ...\r\nUčiteľka mu skočí do reči:\r\n- Kubko, teraz je hodina hudobnej výchovy, takže pekne choď von, zaklop, vojdi a zaspievaj nám, prečo si meškal.\r\nKubko vyjde von, znova vojde bez zaklopania a hovorí:\r\n- Pani učiteľka, prepáčte, že som meškal, ale ...\r\nUčiteľka:\r\n- Kubko, ty mi nerozumieš?!! Je hodina hudobnej výchovy, takže choď von, zaklop a zaspievaj nám, prečo si meškal!!!\r\nKubko vyjde von. Zaklope, vojde a začne spievať:\r\n- La-la-la, paaa-ni uuučííí-teľka, preeepááááčteeee, žeee sooooom\r\nmeeeeškaaaal, aaaaleeeee maaaaamaaaa miiiii uuuumreláááá\r\nša-la-la-la-la-la-li!!!\n', 742, 3.97, 54),
	(12267, 'Nová učiteľka zemepisu mala prvú hodinu v triede, pred ktorou sa triasli i skúsení profesori. Po začiatku hodiny sa ostatní pedagógovia zhromaždili v zborovni a tipovali, koľko minút vydrží. Ale trieda zostala zatvorená až do zvonenia a potom začali na prestávku vychádzať podozrivo pokojní a zamyslení študenti, niektorí mierili priamo do knižnice. \r\nZačali ťahať z učiteľky, ako to odsiahla, až im nakoniec prezradila: \r\n"Najskôr som ich ohromila a potom zaúlohovala." \r\n"A to ako?" \r\n"Keď som vošla do triedy, pozdravila som "ahoj zasrani!" a oni zostali stáť s otvorenými hubami. Tak som sa ich spýtala: \r\n"Viete, čo je prezervatív?" \r\n"Áno." \r\n"A vie ho niekto natiahnuť na glóbus?" \r\n"Lenže nikto nevedel, čo je glóbus, tak to začali zisťovať."               ', 815, 4, 54),
	(12268, 'V škole karhá učiteľka cigánskeho žiaka:\r\n"Dežo, ty tak sprosto nadávaš, až mi z toho behá mráz po chrbte!"\r\n"To keby si počula môjho fotra, tak aj zamrzneš!"               ', 188, 3.67, 54),
	(12269, '-Predstav si, dostala som dnes guľu.\r\n-Prosím ťa a čo si nevedela?\r\n-čo je to H2SO4.\r\n-No to je...počkaj mám to na jazyku.\r\n-Tak to chytro vypľuj, lebo to je kyselina sírová', 183, 3.48, 54),
	(12270, 'Chlapček išiel po prvý raz do školy a keď sa vrátil, dedko sa pýta:\r\n-Koľko je 2 krát 2?\r\n-štyri.\r\nDedko mu dal štyri koruny. Chlapček hovorí:\r\n-Keby som to vedel, tak poviem, že desať.', 200, 3.05, 54),
	(12271, 'Učiteľ sa pýta žiakov:\r\n-Vie niekto z vás nejakú väčšiu jednotku dĺžky ako 1 meter??\r\nJanka:2 metre!!', 112, 3.39, 54),
	(12272, 'Jožko hovorí na hodine učiteľke: Súdružka učiteľka, poďme sa milovať! Učiteľka vezme Jožka do riaditeľne, dá mu facku a hovorí: To máš za tú súdružku! A teraz poď ty nedočkavec!', 200, 3.99, 54),
	(12273, 'Pani učiteľka sa pýta Janka: kedy bola druhá svetovaá vojna? Neviem. A kto ju zapríčinil? Neviem. Tak si to doma zisti! Janko sa pýta babky: kedy bola druhá svetová vojna? Keď bomby padali. A kto ju zapríčinil? Tá hlúpa sviňa nemecká, čo zabíja nevinných ľudí. Na druhý deň: Janko, pýta sa pani učiteľka, kedy si sa narodil? Keď bomby padali. A kto je Tvojim otcom? Ta hlúpa sviňa nemecká, čo zabíja nevinných ľudí.', 451, 3.15, 54),
	(12274, 'Učiteľka pýta žiaka:videl si už niekedy medveďa  \r\nŽiak:áno v telke\r\nUčiteľ:a v lese \r\nŽiak:nie my nenosíme telku do lesa', 133, 3.43, 54),
	(12275, '-Pani učiteľka, môžem byť potrestaný za to, čo som neurobil?\r\n-Nie, Števko, nemôžeš.\r\n-Tak sa priznám. Neurobil som si domácu úlohu.', 146, 3.76, 54),
	(12276, 'Jožko sa pýta učiteľky :pani učiteľka môžem ísť na wc a učiteľka povie:ale najprv mi vymenuj svetové strany. Jožko začne :východ záchod serem juj.', 163, 3.77, 54),
	(12277, 'V skole : Jožko máš domácu úlohu ? TA ne . Celou vetou ! Ta nemám.\r\n', 74, 2.85, 54),
	(12278, 'Na hodinu príde nová mladá sexi učiteľka , sadne si za stôl a pozerá po triede. Zrazu jej Móricko tíško šepká - pretiahnem Vás. Ona naňho pozerá, ale nič mu nepovie. A on za - pretiahnem Vás , tak to ide celu hodinu , az pride po hodine učiteľka za riaditeľom a hovori: pán riaditeľ jeden žiak mi celú hodinu šepkal, že ma pretiahne . Riaditeľ na to : bol z 1.E. -áno,  prvá lavica - áno , Moricko - áno , pretiahne .', 448, 3.61, 54),
	(12279, 'Jožko nadáva pani učiteľke. Ona sa nahnevá a dá mu sto krát napísať: Pani učiteľke sa nenadáva. Jožko príde na druhý deň do školy aj s trestom a pani učiteľka sa ho pýta: Ale Jožko, prečo si to napísal až dvesto krát? Jožko odpovedá: Aby si bola šťastná ty krava.', 293, 3.88, 54),
	(12280, 'Učiteľka vyvolá žiaka pred tabuľu, ukáže na obrázok, ktorý je tam zavesený a pýta sa ho: Tak Janíčko, čo to tu visí za vtáka? Janíčko odpovie: Netopier. Ale žeby visel za vtáka to sa mi teda nezdá.', 218, 3.82, 54),
	(12281, 'Pani učiteľka sa pýta žiakov:-Keď vyjde auto z bodu A rýchlosťou 160 km/h a druhé auto z bodu B rýchlosťou 200 km/h, kde sa stretnú?Jožko sa prihlási a hovorí:-Na dopravnom inšpektoráte...', 204, 4.11, 54),
	(12282, 'Učiteľka sa pýta žiakov: Kto mi povie jednoduchú vetu?\r\n-Prihlási sa Laura, a povie: Dievča máva.\r\n-Učiteľka: Dobre Laura, a teraz tu vetu rozvin.\r\n-Laura: Dievča máva na vojaka.\r\n-Učiteľka: A teraz tú vetu skráť!\r\n-Laura: Štetka!', 248, 3.7, 54),
	(12283, 'Jožko prišiel domov zo školy a otec sa ho pýta: "Čo ste dnes v škole robili?"\r\n"Učili sme sa počítať do 10."\r\n"No, tak mi napočítaj."\r\n"1,2,3,4,6,7,8,9,10."\r\n"A kde si nechal 5?"\r\n"V žiackej knižke."', 213, 3.04, 54),
	(12284, 'Móricko dostal za domácu úlohu napísať čo jeho rodičia povedia, keď pôjde za nimi. Otec hovorí "choď do riti", mama si spieva "ó bejby, bejby, nerob to", sestra je na WC a hovorí "malý zachodový pavúčik, malý záchodový pavúčik" a brat vraví "spajdrmen, spajdrmen." Príde do školy a učiteľka sa ho pýta, či má domácu úlohu.\r\n"Choď do riti."\r\n"Zavolám riaditeľa."\r\n"Ó bejby, bejby, nerob to."\r\nPríde riaditeľ a hovorí mu:\r\n"Čo si myslíš, že kto som ja?"\r\n"Malý záchodový pavúčik, malý záchodový pavúčik."\r\n"A čo si myslíš, že kto si ty?"\r\n"Spajdrmen ,spajdrmen."    ', 621, 3.83, 54),
	(12285, 'Učiteľka sa pýta Jožka: "Ako sa olajú tvoji rodičia?" "Prosím, papuľka a chrobáčik.."', 95, 3.86, 54),
	(12286, 'Pani učiteľka vyvolá malého Dežka: "Dežko, povedz nám zvieratko začínajúce sa na písmenko P."                                                Dežko: "Potkan."                                                                    Učiteľka: "Ale Dežko, tak nám povedz zvieratko na písmenko D.                                                 Dežko: "Dva potkany."             Učiteľka: "Ale už prestaň Dežko, povedz nám teda zvieratko napríklad na písmenko Ž.                                                                         Dežko: "Hm, žeby tri potkany..."', 586, 3.69, 54),
	(12287, 'Jožko sa pýta učiteľky:\r\n- Koľko je hodín?\r\n- Na čo to potrebuješ vedieť?\r\n- Aby som vedel koľko ešte máme matiky?\r\n- Do konca školského roka, a aj v ďalšom ročníku Jožko.', 190, 3.62, 54),
	(12288, 'Mara odišla na služobnú cestu. Manžel ráno zobudí synčeka, vychystá ho a idú do škôlky. Prídu do prvej a vychovávateľka ockovi povie, že k nim synček nepatrí. Idú teda do druhej, tretej, štvrtej a všade mu oznamujú, že k nim jeho synček nepatrí. Keď vyjdú z piatej škôlky, synček vraví ockovi: "Ocko, ešte jedna škôlka a ja to do tej školy už fakt nestihnem načas."', 401, 3.45, 54),
	(12289, 'Na hodine zemepisu. - Móricko a ty nám povedz dôkaz, že sa zem točí!- Na východ sme sa vysrali a hovno prišlo zo západu.', 129, 3.7, 54),
	(12290, 'Poznámka: Vysvetlite prosím vášmu synovi, že kvetináče slúžia na pestovanie kvetov a nie ako bojové helmy !!! \r\nĎakujem\r\n\r\n\r\n', 136, 2.88, 54),
	(12291, 'Janko príde do školy s veľkou hrčou na čele a učiteľka sa ho pýta: Janko, čo ťa uštipla včela? - Už nestihla, ocko ju zabil lopatou.', 145, 3.56, 54),
	(12292, 'Žiačka na hodine skladá puzzle a učiteľka sa jej pýta: "Čo to skladáš?""Ááále nič, len puzzle", odpovie žiačka."No moja počuj, tie puzzle zahoď, radšej si kúp strúhanku a poskladaj rožok", povie jej učiteľka.', 231, 2.83, 54),
	(12293, 'Zo školských lavíc:• Na hodine dejepisu schválne uvádza iné dátumy.\r\n• Váš syn nevhodne dokazuje svoju silu na pracovnej výchove tým, že dievčatám priťahuje zveráky.\r\n• Nedovolený vstup do školy.\r\n• Pozerá sa na mňa cez zelené priesvitné pravítko a smeje sa mi, že som zelený.\r\n• Dáva stále pozor, či dávam pozor, a keď si myslí, že nedávam pozor, tak nedáva pozor.\r\n• Bez povolenia padá zo stoličky.\r\n• Bez vyzvania vybrala na hodine telesnej výchovy kozy a celá trieda cez ne skákala.\r\n• Vedomosti vašej dcéry sa rovnajú nule. Pre postup do vyššieho ročníka je potrebné, aby ich minimálne zdvojnásobila.\r\n• Napovedá nedovoleným spôsobom.\r\n• Dievčatám siaha na mliečne vaky.\r\n• Zlomil zemepisnú mapu o hlavu spolužiaka. Plátno to vydržalo, je nutné opraviť rám.\r\n• Bije spolužiačku dáždnikom, pričom nie je jeho.\r\n• Pravidelne chodí do školy nepravidelne.\r\n• Zjedla pomôcky na výtvarnú výchovu.\r\n• Olizuje temperové farby a diví sa, že potom zvracia.\r\n• Behá po stene.\r\n• Spal na hodine tak tvrdo, že ho neprebudil ani príchod pána riaditeľa, ktorý strašne dupe a funí.\r\n• Lezie do päťmetrovej výšky na dvojmetrový strom.\r\n• Nepíše si čo hovorím, píše iba to, čo potrebuje.\r\n• Cez prestávku silno kopal do dverí a keď bol napomenutý, kopol si drzo ešte raz.\r\n• Stále sa hlási.\r\n• Pľul na schodoch na nižšie postaveného učiteľa vyššieho ročníka, čím znížil jeho vážnosť.\r\n• Ohrozoval spolužiakov nožíkom, ktorý potreboval až na tretej vyučovacej hodine.\r\n• Smrká mi do výkladu.\r\n• Nechá sa od spolužiakov obchytávať a nehlási to učiteľovi.\r\n• Svojim spevom úmyselne rušil hodinu spevu.\r\n• Neustále sa smeje a odmieta mi povedať na čom.\r\n• Vyliezol na okno a tam sa usadil.\r\n• Počas písomky vnucuje spolužiačke správne odpovede.\r\n• Močí do výšky očí.\r\n• Rozbil okno a vyhováral sa, že nemôže dýchať.\r\n• Hlási sa nohami.\r\n• Vaše dcéra opakovane fajčila na chalanskom záchode.\r\n• Smial sa mi do očí za chrbtom.\r\n• Žiak je na hodine!\r\n• Patril k väčšej polovici, ktorá nedávala pozor!', 2222, 4.09, 54),
	(12294, 'Študentky mali napísať esej, ktorá by pojednávala o náboženstve, sexe a tajomne.\r\nNajkratšia práca mala iba jednu vetu:\r\n"Bože, som v inom stave - ale s kým...???"', 174, 4.14, 54);
INSERT INTO `mig_jokes` (`id`, `joke`, `joke_length`, `rank`, `category_id`) VALUES
	(12295, 'Učiteľ napísal do žiackej knižky:\r\nŽiak jedol cez hodinu a neponúkol ma.', 79, 4.12, 54),
	(12296, 'Janko sa chváli v triede. \r\n- Ja mám doma psa a ten vie klamať.\r\nPravdaže mu nikto neverí. Na druhý deň ho prinesie do školy. Významne sa postaví a pýta sa:\r\n- No Beli, ako robí mačička?\r\n- HAF, HAF!', 213, 4.1, 54),
	(12297, 'Pani učiteľka sa pýta: - Deti, kto mi povie svetové strany?\r\nPrihlási sa Janko. - No povedz, Janko.\r\n- Ja len potrebujem ísť na WC.\r\n- Povedz svetové strany.\r\n- Ja vážne chcem ísť na WC.\r\n- Najprv povedz  tie svetové strany...\r\nJanko začne: - Východ,záchod, seriem, juj..! ', 289, 4.13, 54),
	(12298, 'V 8.triede hovorí učiteľka žiakom:\r\n"Ste už dosť veľkí, budeme sa teda rozprávať o antikoncepcii. Čo ste o nej kto počul?"\r\nDeti rozprávajú o pilulkách, kondómoch atď.\r\nPrihlási sa Jurko a vraví:\r\n"Moji rodičia používajú kýbeľ."\r\nUčiteľka sa tomu čuduje a pýta sa Jurka, akože to robia?\r\nA Jurko na to:\r\n"To je jednoduché - naši sa milujú postojačky. Môj ocko je o hlavu menší ako mama, tak si vždy stúpne na kýbeľ a keď začne privierať oči, mama mu ten kýbeľ podtrhne..."\r\n', 521, 3.59, 54),
	(12299, 'Totálny lyžiarsky začiatočník si zlomí nohu počas prvej jazdy na svahu.\r\n- "Je to pokrok" - hovorí záchranárom, - "vlani som si zlomil nohu už pri vystupovaní z vlaku."', 180, 3.56, 54),
	(12300, 'Jožko, odkiaľ pochádzaš?\r\nTa z Košicoch.\r\nKtorá časť?\r\nTa caly, ne?', 75, 3.32, 54),
	(12301, 'Učiteľka: Klimo, kde si bol, veď už dávno zvonilo?\r\nKlimo: Ta som še bul vyšikac.\r\nUčiteľka: Fuj, ako to rozprávaš, hovorí sa: Bol som na malú potrebu.\r\nKlimo: Ta, ja nebul na žadnu potrebu, ja som še bul vyšikac...', 231, 4.11, 54),
	(12302, 'Na hodine náboženstva sa katechét spytuje žiaka: - Jurko, čo musí urobiť človek, aby sa dostal dostal do neba? - Umrieť!', 129, 3.56, 54),
	(12303, 'Učiteľka povie deťom, že ten kto odpovie na jej otázku, nemusí ísť týždeň do školy.\r\nNajprv sa pýta: Koľko je hviezd na nebi?\r\nNikto nevie.\r\nPotom sa pýta: Koľko hektolitrov vody je vo všetkých moriach a oceánoch?\r\nNikto nevie.\r\nIvetke sa to nepáči a natrie melón na čierno a hodí ho do učiteľky.Učiteľka sa spýta: Kto sem hodil ten melón?\r\nIvetka, dovidenia za týždeň!', 402, 4, 54),
	(12304, 'Mórickovi napíše učiteľka do zrkadielka: Smrdí-umývať! A otec doma odpísal: Učiť-nevoňať!', 102, 4.07, 54),
	(12305, 'Učiteľ sa pýta žiaka: - Keď máš v jednom vrecku 4 koruny a stratíš 3 koruny, čo máš vo vrecku? - Dieru, pán učiteľ.', 130, 4.06, 54),
	(12306, 'Učiteľka sa pýta detí v českom jazyku: \r\nKdo mi řekne větu?\r\nPepíček: Jáá!\r\nUčiteľka: Ano!\r\nPepíček: Děvče mává.\r\nUčiteľka: Teď jí rozviň.\r\nPepíček: Děvče mává vojákovi.\r\nUčiteľka: A teď jí skrat!\r\nPepíček: Děvka!', 251, 3.4, 54),
	(12307, 'Rôzne\r\nJeden študent si chcel v univerzitnej jedálni sadnúť na voľné miesto veľa profesora, ale ten mu na to odvrkol: "Labuť nemôže byť priateľom svine."\r\n"No dobre, tak ja teda odletím" odpovedal študent.\r\nProfesora odpoveď urazila natoľko, že sa rozhodol študenta potopiť na skúške, a tak mu dal najťažšie otázky. Avšak študent na každú jednu otázku v teste odpovedal výborne, a tak profesor, s túžbou študenta potopiť, položil mu poslednú rozhodujúcu otázku: "Ideš po ceste a nájdeš dve vrecia. Jedno plné zlata, v druhom je rozum. Ktoré si vyberieš?" "Vrece so zlatom predsa" odpovie začudovane študent.\r\n"Ha, no ja by som bral druhé vrece" potešene reaguje profesor. "No vidíte pán profesor, každý si vyberie to, čo mu chýba" chytro odpovie študent. Profesor od zúrivosti schytí študentov test a vpíše: "Debil".\r\nŠtudent bez toho, aby sa pozrel do testu čo mu tam profesor napísal sa\r\npoďakuje a odíde. O chvíľu sa však vráti s testom v ruke a hovorí profesorovi:\r\n"Nehnevajte sa pán profesor, podpísali ste sa mi, ale známku ste mi\r\nnenapísali."', 1127, 4.22, 54),
	(12308, 'Učiteľka dala žiakom za úlohu zistiť, ako sa narodili. Jožko prišiel domov a pýta sa mamičky:\r- Mamička, ako som sa narodil?\rA mamička vraví:\r- Doniesol ťa bocian, Jožko.\rRáno išiel do školy a na streche zbadal bociana. Vyšplhal sa na strechu a dal si bociana do tašky. Učiteľka sa ho v škole spýtala.\r- Tak, Jožko, už vieš, ako si sa narodil?\rJožko hovorí:\r- No jasné, mám ho vytiahnuť?\r- Nie, nie!!! Nemusíš, máš jednotku!', 459, 4.16, 54),
	(12309, 'Sedia dve sliepky a rozprávajú sa. Jedna z nich hovorí: "Ja som mala včera takú vysokú horúčku, že som zniesla vajce na tvrdo."', 136, 3.51, 54),
	(12310, 'Zápis v žiackej knižke: Vaša dcéra sa počas náboženstva ohadzovala smradľľavou ponožkou, ktorá šírila nepríjemný zápach.Mali by ste svoju dcéru naučiť slušnému správaniu alebo by ste mali používať lepší prací prostriedok!', 250, 3.3, 54),
	(12311, 'Učiteľka sa pýta žiakov čo nám dáva sliepka?Jakubko sa prihlási a hovorí vajíčka a učiteľka na to správne.Potom a učiteľka pýta znova detičky čo nám dáva ovca? A Ondrejko odpovedá vlnu a pani učiteľka na to, že správne Ondrejko. A potom sa pani učiteľka naposledy spýta detičiek, že čo nám dáva krava? Vtom sa niekto zo zadu prihlási a hovorí "domáce úlohy".', 396, 4.07, 54),
	(12312, 'Pani učiteľka sa pýta Jožka: "Jožko, prečo si si robil domácu úlohu v škole?"Pridať na Facebook', 105, 2.44, 54),
	(12313, 'Príde nová učiteľka do triedy na prírodovedu a pýta sa Dežka: "Od akého vtáka sú tieto vajcia?" \r\n"Neviem.""A tieto?""Neviem.""Ako sa voláš chlapče?"Dežko si stiahne trenírky a hovorí: "Skúste uhádnuť podla vajec."', 233, 4.02, 54),
	(12314, 'Učiteľka sa pýta žiakov na prírodovede:\r\n- Terezka, čo dáva ovca?\r\n- Vlnu.\r\n- Dobre. Filipko, čo dáva sliepka?\r\n- Vajcia\r\n- Dobre. Móricko, čo dáva krava?\r\n- Domáce úlohy.', 185, 4.07, 54),
	(12315, 'Dežko povie v škole: "Pani učiteľka, môžem ísť na WC?"Pani učiteľka: "Áno, ale najprv mi vymenuj všetky svetové strany."Dežko: "Východ, záchod, serem, júj!"', 173, 3.99, 54),
	(12316, 'Pani učiteľka sa v škole pýta žiakov: "No deti, ten kto mi povie, čo sa dá jesť, dostane včielku."Ako prvá zdvihla ruku Zuzka a vraví: "Jabĺčko sa dá jesť pani učiteľka.""Správne Zuzka, dostaneš včielku."Potom zdvihne ruku Janko a vraví: "Chlieb sa dá jesť, pani učiteľka.""Výborne Janko, dostaneš včielku."Prihlási sa Móricko a vraví: "Jesť sa dá svetlo."Zhrozená pani učiteľka sa ho pýta: "No Móricko a na to si ako prišiel?"Móricko odpovedá: "No viete, raz večer keď som nemohol spať, počul som mamičku ako vraví Vypni to svetlo a strč mi ho do úst..."\r\n', 606, 4.06, 54),
	(12317, 'Boli tri sestry...\r\nJedna bola škaredá, druhá hlúpa a tá tretia bola tiež učiteľka!!!', 93, 3.94, 54),
	(12318, 'Učiteľka v škole hovorí Dežkovi:\r\n Učiteľka: Dežko, skloňuj slovo chlieb!\r\nDežko: Kto? čo? Chlieb!\r\nS kým? S čím? So salámou!\r\nKomu? Čomu? Mne!  ', 161, 4.08, 54),
	(12319, 'Pani učiteľka sa pýta žiakov. "Deti čo nám dáva sliepka?"Žiaci odpovedajú: "Vajce.""Správne. A čo nám dáva ovca?"Deti sa zamyslia, a potom odpovedajú: "Ovca nám dáva vlnu."Učiteľka sa zamyslí a pýta sa ich: "Deti, a čo nám dáva krava?" A deti na to: "Domáce úlohy."', 290, 3.73, 54),
	(12320, 'Učiteľka sa pýta žiakov kde sa vyrába elektrika?\r\nDežko sa prihlási a povie: "V chlieve.""A na to si ako prišiel???" - pýta sa ho učiteľka.\r\n"No, keď naposledy vypli elektriku ocko povedal, že čo tie svine zas s tou elektrikou robia."', 248, 3.83, 54),
	(12321, 'Pani učiteľka dá deťom úlohu, aby napísali vety, ktoré sa končia „Mama je len jedna“. Ako prvá sa prihlási Anička a vraví: \r\n,,Moja mamička ma každé ráno češe, aby som bola pekná. Mama je len jedna.“ \r\nAko druhý sa prihlási Jožinko a vraví: \r\n,,Mama mi každé ráno robí desiatu. Je veľmi dobrá. Mama je len jedna.“ \r\nA nakoniec sa prihlási Móricko: \r\n,,Raz som prišiel domov, dom smrdel od dymu z cigariet, na koberci bola veľká škvrna od červeného vína a mama bola rozčapená v kresle. Kázala mi, aby som jej priniesol 2 fľašky piva z chladničky. Ja som otvoril chladničku a kričal som na ňu: ,,Mama, je len jedna!!!“\r\n', 675, 3.98, 54),
	(12322, 'Riaditeľ vojde do triedy a hovorí žiakom:\r\n"Kto z vás sa považuje za blbca, nech vstane."O chvíľu vstane jeden žiak. Riaditeľ sa ho pýta: "Ty sa považuješ za blbca?" Žiak mu odpovedá: "To nie, ale zdá sa mi hlúpe, že tu stojíte sám..." ', 255, 4.22, 54),
	(12323, 'Pani učiteľka píše malému Jankovi do žiackej knižky poznámku:\r\n„Váš syn pichal spolužiačku...“\r\nPotom sa zamyslí a dospeje k názoru, že nepoužila správne slovo, a tak si pýta od Janka gumu. Janko jej povie, že nemá gumu, na čo sa pani učiteľka nahnevá a celá bez seba dopíše Jankovi do žiackej knižky:\r\n„......... a ešte k tomu nemal gumu.“\r\n', 380, 4.25, 54),
	(12324, 'Žiaci píšu písomku.\r\nNa druhý deň pani učiteľka dôjde s opravenými písomkami.\r\nPani učiteľka zavolá Jožka a vraví mu: Jožko ty si odpisoval od Miška! \r\nJožko vraví : To nie je pravda, ja som neodpisoval, máte dôkaz?\r\nUčiteľka odpovedá: Áno mám, v tretej otázke má Miško NEVIEM a ty ANI JA!!!\r\n', 323, 4.23, 54),
	(12325, 'Aké je vybrané slovo po "P"?\r\nPijeme.', 39, 3.63, 54),
	(12326, 'Ve tři v noci zazvoní profesorovi telefon, ozve se tichý hlas:" Probudil jsem tě?""Hmmm... ano...""Tak to je dobře, protože já se ještě učím, ty hajzle!!!"', 166, 4.29, 54),
	(12327, '- Viete, aký je rozdiel medzi väzňom a školákom? \r\n- Väzeň vie, za čo sedí. ', 85, 3.82, 54),
	(12328, 'Pani učiteľka sa pýta v triede: „Keď päť vtákov sedí na plote a jedného zastrelíte, koľko ich tam ostane naďalej sedieť?“\r\nFerino sa prihlási a vraví: „Ani jeden, pani učiteľka, všetci odletia pri výstrele.“\r\nPani učiteľka prikývne a odpovedá mu: „Správna odpoveď je štyri, ale páči sa mi tvoje rozmýšľanie, Ferko.“\r\nNa to Ferino hovorí: „Pani učiteľka, aj ja mám pre Vás jednu otázku. Sedia na lavičke tri ženy a každá z nich líže zmrzlinu. Prvá tak opatrne z boku, druhá z hora cmúľa celú, skoro už aj kornútok a tretia jemne hryzká vrch. Ktorá z nich je vydatá?“\r\nUčiteľka sa začervená, ale nakoniec odpovie: „Podľa mňa tá druhá, ktorá si to dáva celé do úst.“\r\nFerino: „Správna odpoveď je tá, ktorá má na prste obrúčku, ale páči sa mi Vaše rozmýšľanie pani učiteľka.“\r\n', 877, 3.69, 54),
	(12329, 'Hodina slovenčiny. Deti majú písať sloh na tému: Som riaditeľom veľkej firmy.\r\nVšetci píšu, len Jožko sedí a obzerá sa.\r\n- Jožko, prečo nepíšeš? - pýta sa pani učiteľka.\r\n - Ja čakám na sekretárku!', 221, 4.23, 54),
	(12330, 'V škole sa pýta pani učiteľka Jožka na hodine Zemepisu:\r\nJožko, kedy bola 1. svetová vojna ?\r\nJožko mlčí.\r\nPani učiteľka sa ho pýta znovu: Jožko kto ju viedol?\r\nJožko mlčí.\r\nPani učiteľka sa ho pýta znovu : Kde bola?\r\nJožko znova mlčí. Dostal 5.\r\nKeď príde domov opýta sa babky: Babka, kedy bola 1. svetová vojna?\r\nA babka na to: 25 páteho keď bomby padali. \r\nBabka kto ju viedol? Hitler tá sviňa prašivá. \r\nKde bola ? Trochu na Morave, trochu na Orave a kúsok na Československu.\r\nJožko celý rád príde do školy že vie tieto veci a učiteľka sa ho opýta:\r\nJožko kedy si sa narodil ? \r\nA Jožko na to : 25 páteho keď bomby padali.\r\nKto je tvoj otec? \r\nJožko na to: Hitler tá sviňa prašivá.\r\nA učiteľka ešte: A kde si sa narodil? \r\nJožko na to: Trochu na Morave, trochu na Orave a kúsok na Československu.\r\n', 861, 4.02, 54),
	(12331, 'Učiteľka na výtvarnej výchove:\r\n- Jožko, a prečo nič nekreslíš?- Ale pani učiteľka ja som už niečo nakreslil!\r\n- Áno a čo? Lebo ja nič nevidím.\r\n- No, nakreslil som vláčik, ale ten už odišiel.', 213, 4.06, 54),
	(12332, 'Skúška z fyziky:\r\nProfesor sa zle vyspal. Pýta sa prvého študenta:\r\n- Idete autobusom a je hrozné teplo, čo urobíte?\r\n- Otvorím okno.\r\n- .... dobre. A teraz popíšte aerodynamické zmeny, ktoré v autobuse nastanú.\r\n- ???\r\nNevedel.\r\n- Ďakujem, zapíšte sa na ďalší termín. Ďalší prosím!\r\nDruhý študent, rovnaká otázka, rovnaká odpoveď, rovnaké hodnotenie.\r\nZa pol hodinu je stav zápasu profesor versus študenti 9 : 0.\r\nAko desiata vchádza pekná študentka. Profesor sa pýta:\r\n- Idete autobusom a je hrozné teplo, čo urobíte?\r\n- Vyzlečiem si košeľu.\r\n- Vy mi nerozumiete, je naozaj teplo.\r\n- Tak si ešte vyzlečiem sukňu.\r\n- Je neznesiteľne horúco, - stupňuje profesor.\r\n- Tak si vyzlečiem aj podprsenku.\r\nTo profesorovi vyrazilo dych. Študentka dodáva:\r\n- Ešte si môžem vyzliecť aj nohavičky, ale to okno neotvorím ani keby ma mal poje*ať celý autobus.', 907, 4.29, 54),
	(12333, 'Pán učiteľ sa na hodine zemepisu pýta:\r\n- Žiaci, čo vám ako prvé napadne keď spomeniem Turecko?\r\nA žiaci zborovo zvolajú:\r\n- Šeherezáda!', 149, 4.07, 54),
	(12334, 'Učiteľka na hodine informatiky vraví žiakovi: Len ma ďalej rozčuľuj a takú ti strelím, že ťa ani Google nenájde. \r\nŽiak na to: A to sa dá?', 152, 3.55, 54),
	(12335, 'Danka príde do lekárne a vraví: "Prosím si nejaké upokojujúce lieky!"\r\n"A pre koho?" pýta sa lekárnik.\r\n"Pre rodičov... nesiem domov vysvedčenie!"', 156, 4.15, 54),
	(12336, 'Na medicíne vedie profesor prednášku o sexuálnych anomáliách u mužov. Nakoniec chce zistiť, do akej miery študenti prednášanú látku zvládli. Pýta sa teda: \r"Ako hovoríme mužovi, ktorý chce, ale nemôže?" \r"Impotent, "odpovedajú všetci zborovo. "A ako hovoríme mužovi, ktorý môže, ale nechce?" \rRozhostí sa hrobové ticho. Naraz vzadu vyskočí jedna študentka a začne kričať: \r"Hajzel je to! Hnusný hajzel', 437, 4.18, 54),
	(12337, 'Otec hovorí svojmu synovi:\r\n-Vždy keď stretneš niekoho cudzieho, hovor "áno".\r\nNa druhý deň ide chlapec zo školy a stretne skinheada. Ten sa ho pýta:\r\n-Chceš dostať?\r\nA chlapec odpovie:\r\n-Áno. \r\nSkinhead ho zmláti. Chlapec príde domov, kde ho zbadá otec a tak mu vraví: \r\n-Keď opäť stretneš niekoho cudzieho, hovor stále "nie".\r\nCestou zo školy, chlapec stretne opäť toho istého skinheada a ten sa ho spýta:\r\n-Nestačilo ti?\r\nA chlapec odpovedá: "Nie."', 479, 4.02, 54),
	(12338, 'Učitelka hovorí žiakom: "Ak cez víkend zahrešíte tak donesiete toľko kamienkov koľkokrát zahrešíte."\r\nV pondelok už prichádza Anka: "Ja nemám kamienky." "To je dobré!" \r\nPríde Janko: "Ja mám iba dva kamienky"\r\n"No, to nie je až také dobré" hovorí mu učiteľka.\r\nPotom príde Móricko: "Pál do pi*i, ja nesiem štrk!"', 339, 4.28, 54),
	(12339, 'Pýta sa pani učiteľka žiaka:\r\n- Vieš mi Jurko povedať čo to nad tabuľou visí za vtáka?\r\n- Viem pani učiteľka... to je  netopier,..... ale on nevisí za vtáka, ale za nohy!', 184, 3.47, 54),
	(12340, 'Vysokoškolský profesor sa na staré kolená oženil s mladou ženou. Príde prvý deň po svadbe do školy, otvorí tabuľu a na nej je napísané:\r\n- " Oženil sa starý pán, ženu nechal je..ť nám..." \r\nProfesor to zotrie z tabule a napíše: \r\n-"Zostane to medzi nami, ja som je..l vaše mami!" ', 303, 4.25, 54),
	(12341, 'Pani učitelka hovorí žiakom, že ten kto povie jednu nadávku dá na stôl 0,50 €. Jožko hodí na lavicu 1 € a hovorí:Tu máš ty p**a vyj****á.', 154, 4.16, 54),
	(12342, 'Učiteľka hovorí žiakom:\r\nMyslím si zvieratko, ktoré sa začína na Z.\r\nNikto nevie a tak učiteľka napovedá.\r\nUčiteľka: ZE...\r\nZasa nikto nevie a tak učiteľka napovedá ďalej.\r\nUčiteľka: ZEB...\r\nPrihlási sa malý Jožko a hovorí:\r\nZEBy to bol tiger?', 266, 3.83, 54),
	(12343, 'Otec sa pýta syna:\r\n-Čo ste robili dnes na vyučovaní?\r\n-Na hodine chémie sme sa zaoberali výbušnými látkami.\r\n-A čo máte na programe zajtra v škole?\r\n-V akej škole?\r\n', 179, 4.28, 54),
	(12344, 'Učiteľka hovorí žiakom:\r- Ako vidíte žiaci, vonku nám krásne sneží, čo keby sme začali s guľovaním?\r- Áno, áno - kričia deti.\r- No dobre... k tabuli príde Nováková!', 184, 3.81, 54),
	(12345, 'Ako sa volá western spoza školských lavíc?\r?\r?\r?\rSedem nedostatočných.', 76, 3.69, 54),
	(12346, 'Učiteľka vraví deťom v škole: \r- Keď príde Móricko a povie nejaké neslušné slovo, dievčatá vstanete a odídete z triedy. \rA tak začala hodina. Učiteľka sa pýta detí: -\rTak detičky, kto mi povie, čo je nového v našom meste? \rMóricko sa prihlási a povie: \r- V našom meste sa stavia bordel. \rNa to dievčatá vstanú a odídu. Móricko za nimi kričí: \r- Kde utekáte, vy ku**y, ešte sú len základy.', 425, 4.29, 54),
	(12347, 'Pani učiteľka sa vyberie so žiakmi do ZOO. Prídu k levom a učiteľka sa ich pýta: „Kto mi povie aké je toto zvieratko?” Nikto nevie, tak im napovedá: „L ... Le ...”\r\n„Lenin!!!” vykríknu žiaci.\r\n„Nie, lev” opraví ich učiteľka.\r\nPokračujú ďalej až dôjdu ku zebrám.\r\nUčiteľka sa ich znova pýta. „ Kto mi povie aké je toto zvieratko?” Znova nik nevie, tak napovedá. „Z ... Ze ...”\r\n„Zeby Lenin???” odpovedajú žiaci.\r\n„Nie, zebra” opraví ich učiteľka.\r\nIdú ďalej a zastavia sa pri koníkovi.\r\n„Kto vie aké je toto zvieratko?” pýta sa ich učiteľka. Zasa nikto nevie, znova napovedá. „K ... Ko ...”\r\n„Konečne Lenin!!!”', 692, 4.22, 54),
	(12348, 'Študenti medicíny na pitevni, kde im profesor hovorí:\r\n-Tak študenti, pravidlo č. 1 je "Odvaha" a strčí mŕtvole prst do zadku, potom ho vytiahne a olíže.\r\nVšetci študenti, ešte s obedom v krku, opakujú po profesorovi a po jednom strčia ukazovák do zadku mŕtvoly a potom ho olížu.\r\nProfesor pokračuje: -Tak študenti a pravidlo č. 2 je "Postreh!" Určite ste si všetci všimli, že síce som do zadku strčil ukazovák, ale olízal som si prostredník...', 475, 4.21, 54),
	(12349, 'Na hodine matematiky sa učiteľ pýta krčmárovho syna:\r\n- Koľko 1dcl pohárikov sa dá načapovať z litrového suda?\r\n- Ále, niekedy aj 12... ', 148, 3.88, 54),
	(12350, 'Matka vraví synovi:\r\n- Jurko, umy si ruky kým pôjdeš do školy.\r\nA Jurko na to:\r\n- Prečo, veď sa nebudem hlásiť.', 120, 4, 54),
	(12351, 'Mama pripravila na novoročný obed zajaca, ktorého otec vlastnoručne zakľal. Pretože deti milovali svojho zajka, zamlčala im pravdu. Malý syn sa s veľkou chuťou pustil do jedla a pýta sa otca: "Tati, čo je to vlastne za mäsko?"\r\nTatko hrdo odvetí: "No, hádaj. Dám ti tip. Mamina ma tak občas volá".\r\nVtom dcéra vypľuje všetko do taniera a hovorí bratovi: "Preboha, nejedz to, to je koko...".', 412, 4.15, 55),
	(12352, 'V reštaurácii:\r\n- Pán hlavný, ten rezeň, čo som si objednal je ako plech. Mohli by ste mi ho vymeniť, prosím?\r\nČašník:\r\n- No tak teraz už nie, keď ste ho ohli.', 172, 3.14, 55),
	(12353, 'Vieš, aký je rozdiel medzi sexovaním a bicyklovaním?\r\nNie? Tak sa bicykluj ďalej.', 86, 3.13, 55),
	(12354, 'Konateľ spoločnosti na konci ročného obdobia rozdáva prémie. Sebe si dá také, že si za ne kúpi nový dom, nové auto a čo mu zostalo, dal si do švajčiarskej banky. Ide za majstrom a pýta sa ho. \r\n- Majster, dal som ti prémie, čo si za ne kúpil? \r\n- No, teraz prerábam chalupu, tak tam išli nejaké peniaze. \r\n- A ostatné? \r\n- Ostatné som si dal do banky na knižku. \r\nIde za robotníkom. \r\n- Robotník, dal som ti prémie, čo si si za ne kúpil. \r\n- Kúpil som si nové montérky. \r\n- A ostatné? \r\n- A ostatné som si musel doložiť.', 557, 3.31, 55),
	(12355, '- To je dnes ale zlé počasie.\r\n- No, ale lepšie ako nič.', 60, 2.98, 55),
	(12356, '- Pane báčo, za kolik dní snese ovce takovýhle "oštiepok"?', 63, 3.03, 55),
	(12357, '- Mami, kto je ten černoško u nás v kuchyni?\r\n- Nedotýkaj sa babky, ešte je pod prúdom.', 93, 3.32, 55),
	(12358, '"Kukučka, kukučka, koľko rokov sa dožijem?"\r\n"Ku!"\r\n"A prečo tak má...', 76, 3.21, 55),
	(12359, 'Každý piaty človek na svete je Číňan. Naša rodina je päťčlenná, teda jeden z nás je Číňan. Mohol by to byť oco, mohla by to byť mama, mohol by to byť môj brat Šani, malý PO-WONG, alebo ja. Podľa mňa je to Šani.', 234, 3.49, 55),
	(12360, 'Žena za volantom, to je ako hviezda na nebi! Ty ju vidíš, no ona teba nie.', 77, 4.01, 55),
	(12361, 'Štart lietadla, kapitán ako obyčajne:\r\n- Vážené dámy a páni, pekne vás vítam na palube. Náš let prebieha nad Atlantickým oceánom, vo výške 10 000 metrov, rýchlosť 900 km/h, teplota vzduchu... sakra, ja tvoju mater... do šľaka!\r\nKapitán sa odmlčí, mŕtvolne ticho, pasažieri bledí, panika, krik... Po dlhšej chvíli kapitán:\r\n- Dámy a páni, prosím, ospravedlnte ma. Letuška ma oliala kávou. Keby ste videli moje nohavice spredu...\r\nJeden z pasažierov:\r\n- Ty chuj! Keby si videl moje nohavice zozadu...', 533, 3.68, 55),
	(12362, 'Príde chlapček do mäsiarstva a spýta sa predavača:\r\n- Máte mozoček?\r\n- Nie - odpovie predavač.\r\n- Tak preto vyzeráte tak blbo!', 135, 3.33, 55),
	(12363, '- Chcem byť milionár ako môj otec!\r\n- Výborne, máš otca milionára? \r\n- Nie, ale aj on chce byť milionár.', 113, 3.1, 55),
	(12364, 'Uprostred noci hovorí otec nádejnému zaťovi:\r\n- Chlapče, dohodli sme sa, že mi dcéru privediete domov ešte pred polnovou. Teraz sú tri hodiny ráno a tato dáma nakoniec nie je ani moja dcéra.', 202, 3.34, 55),
	(12365, 'V reštaurácii:\r\n"Čašník, v polievke mi pláva načúvací strojček!"\r\n"Prosím?"', 86, 3.11, 55),
	(12366, 'Myšlienka dňa:\r\nŹeny síce vedia predstierať orgazmus, no muži vedia predstierať celý vzťah.', 100, 3.22, 55),
	(12367, 'Zhovárajú sa Fero a Mišo. Fero vraví: \r\n- Ráno som išiel po ulici a tu, z ničohonič ma zasiahla plechovka rovno do hlavy. \r\n- A čo v nej bolo? \r\n- Nič. \r\n- A v plechovke?\n', 181, 3.14, 55),
	(12368, 'Obchodník z realitnej kancelárie ponúka byt zákazníkovi!\r\n- Tento byt má nevýhody aj výhody. Nevýhodou je, že na jednej strane je chemická továreň, na druhej strane bitúnok.\r\n- A akú má výhodu?\r\n- Vždy je vedieť, odkiaľ fúka vietor.', 253, 3.18, 55),
	(12369, 'Stretnú sa dvaja.\r\n- Nevideli sme sa už niekde?\r\n- Neviem, hádam na Malte.\r\n- Ja som na Malte ešte nebol.\r\n- Veď ani ja.\r\n- Tak to museli byt iní dvaja.', 158, 3.15, 55),
	(12370, 'Ráno zazvoní telefón. Pán ho zodvihne a pýta sa:\r\n- Kto je tam? \r\n- Tu je budenie telefónom. Vy ste sa dali zobudiť ráno o siedmej? \r\n- Áno dal. \r\n- Tak šup šup hore vy spachtoško, už je desať.', 207, 3.15, 55),
	(12371, 'Na safari...\r\n- Keď k vám príde lev, hoďte mu do očí kopu hovna a kým sa poutiera, vy zatiaľ zdrhnite preč!\r\nTurista na to:\r\n- A kde zoberiem takú veľkú kopu hovna?\r\nSrievodca s úsmevom:\r\n- Len počkajte, keď sa objaví lev!', 238, 3.24, 55),
	(12372, 'Aký je rozdiel medzi ženou a uterákom?\r\nVeľký. Na uteráku hľadáme suché miesta.', 88, 3.42, 55),
	(12373, '- Novák vyzeráš hrozne. Čo je s tebou? Nebol si na dovolenke tohto roku?\r\n- Veď práve, bol... \r\n- A kde si ju strávil?\r\n- Dva dni v aute na dne priepasti a potom dva mesiace v nemocnici...', 195, 3.05, 55),
	(12374, 'Na spoločenskom podujatí sa mladý lovec priplichtí k dobre vyzerajúcej dáme a nadväzuje rozhovor:\r\n- Tancuješ?\r\n- Tancujem, plávam, lyžujem, korčuľujem...\r\n- Čo to sem pleties?\r\n- Pletiem, vyšívam, hačkujem, batikujem...\r\n- A do riti!\r\n- Do riti, do úst, do vagíny, rukou...', 292, 3.54, 55),
	(12375, 'Stretnú sa dvaja renomovaní režiséri v Hollywoode a jeden pomedzi kotúče z havanskej cigary hovorí:\r\n"Plánujem natočiť film o živote a aktivitách Dannyho de Vita. V hlavnej úlohe by mal byť Arnold Schwarzenneger."\r\n"Arnold? Prečo on? Prečo by si nezahral sám seba Danny de Vito?"\r\n"To nepôjde. Je veľmi malý..."', 331, 3.25, 55),
	(12376, 'Hádanka: \r\nSedíte v krásnom červenom Cabriolete. Pred vami je lietadlo a za vami námorná loď. Ako prestúpite z auta na lietadlo?\r\nZastavíte kolotoč!', 158, 3.28, 55),
	(12377, 'Lietadlo padá k zemi. Pilot nadviaže spojenie s kontrolnou vežou:\r\n- Mayday, mayday, veža. Padáme k zemi. Stroj sa nedá ovládať!\r\nA veža na to: \r\n- V poriadku, v poriadku, už vás škrtám zo zoznamu.', 210, 3.55, 55),
	(12378, '80-ročnému starčekovi lekár dá zazátkovanú fľašu a hovorí:\r\n"Potrebujem vzorku vašej spermy. Prineste mi ju zajtra v tejto fľaši na analýzu."\r\nNa druhý deň starček príde a fľaša je prázdna\r\n"Čo sa stalo?" - pýta sa lekár\r\n"Nešlo to. Skúšal som najprv ľavou rukou, potom pravou rukou a furt nič. Tak som zavolal starkú. Aj ona to skúsila najkôr ľavou, potom pravou, potom oboma rukami a dokonca aj ústami, s protézou aj bez, a nič... Tak sme zavolali našu mladú susedku. Aj ona skúsila oboma rukami, ústami, ako sa len dalo..."\r\nDoktor doslova šokovaný: \r\n"Čože, vy ste na to zavolali aj susedku?"\r\n"No áno, ale nech sme sa snažili ako sme chceli, tú fľašu sa nám otvoriť nepodarilo!"', 734, 3.59, 55),
	(12379, '- Prosím vás, čo stojí ten pes?\r\n- Ja neviem prečo si nesadne.\r\n- Ale ja sa pýtam koľko stojí?\r\n- Asi tak dve hodiny.', 125, 3.13, 55),
	(12380, 'Dve trinásť ročne slečny sa rozprávajú:\r\n- Už som sa prvý krát milovala.\r\n- Héj? A bolo to z lásky alebo za peniaze?\r\nPrvá sa zamyslela.\r\n- Muselo to byť z lásky, lebo za 500 korún si nič nekúpiš.', 214, 3.12, 55),
	(12381, 'Nová Česko - Slovenská hymna\r\n----------------------------\r\nKde domov můj, člunem tam pluj.\r\nVoda hučí, po ulicích,\r\nauta plují na silnicích.\r\nRybník mám hned za domem,\r\nzvyklej sem, na povodeň.\r\nA to je ta země česká,\r\ndomov můj - morský svět,\r\ndomov můj - v blátě květ.    \n\r\nNad Tatrou sa blýska,\r\nDevín brehy myju,\r\nvodné pár - ko - viská\r\nv meste dominujú.  \n\r\nPKO je v čudu,\r\npomôže len voo - doo,\r\ndunajom sa stalo.\n\r\nV bahne mesto leží,\r\nLunapark s nábrežím,\r\nzobral vody prúd.', 523, 2.97, 55),
	(12382, 'Chlapík si objedná v reštaurácii rezeň a nájde v ňom chlp. Zavolá si čašníka a pýta sa ho, ako sa do rezňa dostal ten chlp.\r\n- No, viete, mi máme jednorukého šéfkuchára a ten šúľa rezne na prsiach.\r\nKeď sa chlapík na neho zhrozene pozrie, dodá:\r\n- A to ste ho ešte nevydeli robiť plnené papriky.', 322, 3.43, 55),
	(12383, 'Na zamyslenie:\r\n"Muži sú ako žuvačky, postupne strácajú chuť."', 69, 3.13, 55),
	(12384, '- Slečna, čo sa na mňa tak pozeráte, akoby ste mali voľný byt.', 68, 3.39, 55),
	(12385, 'Pýta sa Ivan Milana:\r\n- Čo by si si vybral? Raz pretiahnuť Katku, alebo dvakrát Luciu?\r\n- Katka je Katka. Ale dvakrát je dvakrát. ', 136, 3.4, 55),
	(12386, 'Kto je absolútny sedlák?\r\nTen, kto ešte aj zmrzlinu je nožíkom.', 68, 2.96, 55),
	(12387, 'Američan, Rus a Slovák stoja pri Niagarských vodopádoch. Pýtajú sa Američana, na čo myslí, keď vidí Niagarské vodopády. \r\n- Ja myslím na to, ako by sme tu vybudovali rekreačné zariadenie, bol by z toho super biznis!\r\nRus hovorí:\r\n- Ja rozmýšľam, aká super vodná elektráreň by sa tu dala postaviť, koľko elektrickej energie by sme vyrobili!\r\nA Slovák odpovedá: \r\n- Ja myslím na sex!\r\n- A prečo myslíš na sex?\r\n- Lebo ja stále myslím len na sex!', 477, 2.84, 55),
	(12388, 'Pán Novák hovorí pánovi Horákovi:\r\n- Počujte, potom, ako ste u nás boli s manželkou na návšteve, stratil sa nám jeden strieborný príbor.!\r\n- Preboha, hádam si nemyslite, že sme ho vzali my?!\r\n- No, on sa potom hneď našiel, ale viete, to podozrenie tu už zostane.   ', 283, 3.49, 55),
	(12389, 'Rozprávajú sa dve osemnástky:\r\n- Máte doma tlačiareň?\r\n- Jasnačka!\r\n- Tak si doma vytlač tie vyrážky, čo máš na ksichte!', 133, 2.92, 55),
	(12390, '- Konečne mi už vytrhli chorý zub.\r\n- A už ta nebolí?\r\n- Neviem, zostal u zubára.', 87, 2.96, 55),
	(12391, 'Dvaja chlapi sa rozprávajú:\r\n- Nevidel si Jana? \r\n- Leží v nemocnici s rozbitou hlavou. \r\n- Vážne?! Veď ešte včera som ho videl v bare s krásnu blondínkou. \r\n- No veď práve, aj jeho žena ho tam videla!', 215, 3.14, 55),
	(12392, 'Pri tanci:\r\n- Pri vás sa cítim ako cukrová repa.\r\n- Taká sladká?\r\n- Nie, tak často okopávaná.', 101, 3.12, 55),
	(12393, 'V byte zazvoní telefón:\r\n- Haló, je doma Karol?\r\n- Nie, tu žiaden Karol nebýva!\r\nPo chvíli opäť zazvoní telefón:\r\n- Haló, je doma Karol?\r\n- Nie, veď Vám vravím, že tu žiaden Karol nebýva!\r\nPo ďalšej chvíli znovu zazvoní telefón:\r\n- Nazdar, tu je Karol, nehľadal má niekto?', 296, 3.17, 55),
	(12394, 'Umrie terorista a príde pred nebeskú bránu.\r\nSv. Peter: \r\n- Nie, nie. Ty si veľa hrešil, teba nemôžem pustiť do neba.\r\nTerorista: \r\n- No, ja tam ani nechcem ísť, ale vy máte tri minúty na evakuáciu.', 211, 3.27, 55),
	(12395, 'Optimista sa učí anglicky.\r\nPesimista sa učí po rusky.\r\nRealista sa učí strieľať.', 89, 3.61, 55),
	(12396, 'Stupňovanie:\r\n1. Blbý\r\n2. Blbší\r\n3. Teleshoping', 51, 3.43, 55),
	(12397, 'Dvaja indiáni zablúdia v púšti.\r\n- Vystreľ, povie jeden, možno nás niekto bude počuť.\r\nVystrelí a nič. O chvíľu mu priateľ zasa povie:\r\n- Nože, vystreľ ešte raz.\r\n- Už nemôžem, minuli sa mi šípy. ', 218, 3.62, 55),
	(12398, 'Príde raz šerif do salónu a vidí na zemi mŕtveho muža. Pýta sa teda barmana:\r\n- Hráč?\r\n- Áno.\r\n- Falošný?\r\n- Áno.\r\n- Poker?\r\n- Nie, husle.', 151, 2.91, 55),
	(12399, 'Stretne holohlavý hrbatého a pýta sa ho:\r\n- Počuj kolega, čo to máš na chrbte?\r\n- Vysielačku, ty debil brčkavý.', 121, 3.06, 55),
	(12400, 'Žena príde do obchodu s vtákmi a chce kúpiť papagája. Vyberie si jedného, ale predavač jej ho nechce pradať, pretože vraj bol predtým v bordeli a pochytil tam veľa zlého. Žena ale namieta, že oni sú slušná rodina a naučia ho slušnosti. Tak jej ho predavač nakoniec predá. Papagája prinesie domov a postaví ho do haly. Po chvíli príde domov jej najstaršia dcéra a papagáj spusti:\r\n"Jéj, nová masérka, nová masérka."\r\nŽena mu povie, že to nie je nová masérka, ale jej najstaršia dcéra ku ktorej sa bude správať slušne. Tak sa to opakuje až po najmladšiu dcéru. Večer sa vráti domov jej manžel a papagáj celý naradostený skríkne:\r\n"Jéj, konečne známa tvár. Nazdar Karol."', 725, 3.76, 55),
	(12401, 'Keď ide muž do krčmy, má slintačku.\r\nKeď ide z krčmy, má krívačku.\r\nA doma ho čaká šialená krava.', 111, 3.16, 55),
	(12402, 'Colník sa pýta vodiča autobusu:\r\n- Cigarety, alkohol, drogy?\r\n- Nie, ďakujem, mám vlastné.', 96, 2.61, 55),
	(12403, 'Ide otec so synom a syn mu riekne:\r\n- Oci, treba mi síkať.\r\nA otec mu vraví:\r\n- Však ty si ešte malý. Hovor, že ti treba piškať!\r\nVstane ráno Janko a vraví mame:\r\n- Mami, treba mi piskať.\r\n- Tak skoro ráno kvôli tomu budíš rodičov?\r\n- Ale mami, mne treba piskať.\r\n- No dobre, zapískaj mi do ucha, ale potichu!', 328, 3.21, 55),
	(12404, 'Afričana sa pýtajú, ako bolo na dovolenke:\r\n- Výborne, celý týždeň pršalo.', 83, 2.98, 55),
	(12405, 'Kovboj kričí na farmára:\r\n"Hej farmár, býk ti nabral ženu na rohy!"\r\nFarmár nepohne ani brvou.\r\nKovboj kričí zas:\r\n"Farmár, býk ti nabral ženu na rohy. Čo si hluchý?"\r\nFarmár mu na to hovorí:\r\n"Ale nie, len ma bolia kurevsky zuby a nemôžem sa smiať!!!"', 271, 3.53, 55),
	(12406, 'Svadobčania prídu k fotografovi. Ten preruší vravu prítomných slovami: \r\n- Vážení! Rád by som odfotografoval najšťastnejšiu dvojicu tohto večera. Prosím matku s dcérou, aby pristúpili.', 201, 3.25, 55),
	(12407, 'Jeden pán sa pýta jedného chlapca.\r\n- Koľko máš rokov?\r\n- Neviem.\r\n- Fajčíš?\r\n- Fajčím.\r\n- Piješ?\r\n- Pijem.\r\n- Máš frajerku?\r\n- Nemám.\r\n- Tak potom máš 3 roky. ', 177, 2.89, 55),
	(12408, 'Chcete niekomu vyvrátiť názory?\r\nTak ho najprv pozvite na burčiak a potom na kolotoče.', 91, 2.83, 55),
	(12409, 'Chlapík drhne mydlom rifle:\r\n- Nikomu sa nedá veriť, nikomu, dokonca ani sebe...\r\nĎalej drhne rifle:\r\n- A to som si chcel len prdnúť!', 139, 3.46, 55),
	(12410, 'Vletí chlap do krčmy a zvrieskne:\r\n- Ktorý cvok mi natrel koňa na zeleno?\r\nPostaví sa dvojmetrový chlap a vraví:\r\n- Ja. No a čo? \r\n- No veď ja nič, len ste ho ešte zabudli nalakovať.', 194, 2.99, 55),
	(12411, 'Ak máš pocit, že si všetkým ľahostajný, že ti už je všetko jedno, skús neposlať daňové priznanie!', 111, 3.18, 55),
	(12412, 'Mama s otcom idú do kina a aby sa malý synček nenudil, dajú mu na uši slúchatka z gramofónu a pustia mu gramofónovú platňu s rozprávkou. Keď sa o 2 hodiny vrátia, nájdu synčeka mykať hlavou a kričať  "Áno chcem, chcem". Čudujúci otecko si dá na hlavu slúchatka a počuje: \r\n- Deti, chcete počuť rozprávku? (skreč) - Deti, chcete počuť rozprávku (skreč) ....', 388, 3.3, 55),
	(12413, 'Franci si dal ušiť u krajčíra oblek.\r\nPríde si pre oblek, ale dajako mu pri odskúšaní blbo stojí.\r\nPýta sa čo to má znamenať a krajčír mu hovorí:\r\n"Zdvihnite pravú ruku hore, rozkročte viac nohy a pravú nohu dajte viac dopredu."\r\nFranci pozrie do zrkadla a oblek sedí.\r\nNa druhý deň ide na ples po námesti, presne ako mu krajčírko povedal.\r\nSledujú ho ľudia a hovoria:\r\n"Pozrite, chudák...."\r\n"...ale krajčíra ma dobrééého!"', 457, 3.23, 55),
	(12414, '- Prepáčte, kde sa tu dá vyšťať?\r\n- Bazény sú tadiaľ!', 62, 3.23, 55),
	(12415, '- Pozri sa na tamtoho chalana, aké má krivé nohy!\r\n- No čo, to je môj syn!\r\n- Eee, ale mu pasujú beťárovi!', 114, 3.24, 55),
	(12416, 'Janko príde zo školy domov s poznámkou v žiackej knižke: "Váš syn nevie pochopiť rozdiely medzi mužom a ženou. Porozprávajte sa s ním o tom." Mamička teda vraví: \r\n- Janko, rozopni moju blúzku.\r\nJanko rozopne jej blúzku. \r\n- Janko, rozopni moju podprsenku.\r\nJanko rozopne jej podprsenku. \r\n- A teraz daj dolu moje nohavičky.\r\nDá dolu jej nohavičky a mamička mu vraví: \r\n- Janko, a prosím ta, už nikdy nechoď do školy v mojom oblečení!', 461, 3.67, 55),
	(12417, 'Babka s dedkom sa po 70 rokoch manželstva dohodli, že si dajú rande ako za mlada..\r\nDedko čaká na babku pod dubom hodinu, dve, tri, ... a keď sa zotmie príde domov za babkou a pýta sa jej:\r\n"Prečo si neprišla?"\r\n"Vieš, naši ma nepustili."', 250, 3.12, 55),
	(12418, 'Prídu dvaja cowboji do salónu a jeden hovorí druhému:\r\n- Vidíš tamtoho v tom čiernom blobúku pri pulte?\r\n- Všetci majú čierne klobúky. \r\n- Tak ten v tej kockovanej košeli. \r\n- Všetci majú kockovanú košeľu. \r\nUž sa nahnevá a vystrieľa všetkých pri pulte až na jedného a hovorí: \r\n- \'Vidíš tam toho, tak toho nenávidím.', 347, 3.22, 55),
	(12419, 'Príde pani do drogérie a pýta si niečo proti komárom. Vedúci ide do skladu a za chvíľu prinesie injekčnú sadu a vysvetľuje:\r\n- Keď chytíte komára, zoberte injekciu a pichnite mu ju rovno medzi oči. Do 5 minút uhynie.\r\n- Ale to keď ho chytím, to ho môžem rovno zabiť!\r\n- No, alebo tak.', 305, 4.19, 55),
	(12420, '- Jano, požičaj tisíc korún.\r\n- Nemám u seba.\r\n- A čo doma?\r\n- Ďakujem, všetci sú zdraví.', 99, 3.32, 55),
	(12421, 'Viete ako spoznáte doktora v obchode?\r\nPlatí zasadne dvadsaťkorunáčkami!', 77, 3.39, 55),
	(12422, 'V somálskom tábore sa ozve z rozhlasu: \'Obed sa bude podávať pri západnej bráne!\'\r\nVšetci somálčania  sa rozbehnú k západnej bráne a v tom sa ozve z rozlasu: \'Zmena!!! Obed sa bude podávať pri južnej bráne!\' \r\nPre zmenu všetci bežia k južnej bráne, keď sa ozve z rozhlasu: \'Pre pobehovanie po tábore sa dnes obed podávať nebude! \'', 354, 3.19, 55),
	(12423, 'Vieš, aký je rozdiel medzi syfilisom a lastovičkou?\r\nSkús chytiť lastovičku!', 82, 3.42, 55),
	(12424, 'Skáče päťročné dievčatko cez švihadlo. Príde k nemu chlap s nožom v ruke a vraví:\r\n- Chceš žiť?\r\nA ona na to:\r\n- To akože s tebou, ty debil?', 155, 3.37, 55),
	(12425, 'Novinár sa pýta milionára:\r\n- Ako je možné, že keď ste sa v škole tak zle učili, teraz máte milióny?\r\n- Je to jednoduché, odpovedá milionár. Kúpim za päťdesiat, predám za sto a štyri percentá mi stačia, no nie?', 231, 3.35, 55),
	(12426, '- Vy ste už u nás boli? - spytuje sa holič zákazníka.\r\n- Hej, raz ste má už holili.\r\n- Zaujímavé, nepamätám sa na vašu tvár.\r\n- Nuž, odvtedy sa už zahojila.', 171, 3.06, 55),
	(12427, 'Udychčaný mladý poštár príde k dedkovi s dôchodkom a hovorí:\r\n- Dedo! Už ma nebaví chodiť každý mesiac za vami na samotu 18 km od dediny!\r\nDedko na to:\r\n- Ma neser, lebo si objednám dennú tlač!', 209, 3.51, 55),
	(12428, 'V reštaurácii:\r\n- Pán vrchný, chcem sa opýtať,  či u vás ešte pracuje ten čašník, u ktorého som si objednal vyprážaný rezeň s hranolkami?!', 155, 3.22, 55),
	(12429, 'Muž sa doma dobre najedol a kedže bol doma sám, tak si poriadne prdol. A zrazu zvonček - cing. Preľakol sa. Skočil do kúpeľky po lesnú vôňu a posprejoval byt. Otvorí dvere svojmu kamarátovi. Ten už na prahu dverí poťahuje nosom, vonia a hovorí:\r\n- Čo ti tu tak cítiť, ako keby sa v lese niekto posral?', 321, 3.55, 55),
	(12430, '- Pán vrchný, kde je ta blonďatá slečna s dlhými nohami, čo pred chvíľou roznášala koňak?\r\n- Neviem, ale ak si prosíte koňak, hneď vám prinesiem.\r\n- Ďakujem, koňak si neprosím, ja hľadám manžela.', 217, 3.06, 55),
	(12431, 'Sedím si jedného dňa na dvore, keď tu zbadám, ako môj pes niečo vlečie  popod susedov plot. Bol to králik. Na svoje veľké zhrozenie som si uvedomil, že je to miláčik desaťročnej susedovej dcéry. Každý deň som  pozoroval, ako vždy keď prišla zo školy, pribehla rovno ku klietke,  vypustila ho von a hrala sa s ním až do večera. Psa som ani nepotrestal. Bolo treba pracovať rýchlo. Králik bol dosť špinavý, tak som ho najprv opral v práčke, potom učesal hrebeňom, vyfúkal fénom a nakoniec trochu navoňavkoval lesnou vôňou, pretože už začínal zapáchať. Potom som preskočil plot a dal ho späť do klietky, dúfajúc, že si susedia budú myslieť, že zomrel prirodzenou smrťou. Len tak tak som to stihol,  než sused priviezol dcérku zo školy. Malá vybehla ku klietke ako zvyčajne. Ibaže kúsok pred ňou sa zastavila a zarevala, až sa hory otriasali: \r\n- OOOOOTTEEEEECCCKKKOOOOOOOOOO !!!\r\nJej otec s hrôzou na tvári podišiel ku klietke. Ako dobrý sused som sa hneď spoza plota opýtal, či sa niečo stalo a ako by som mohol pomôcť. Jej otec len ticho prehovoril: \r\n- To by som chcel vedieť, ktorý chuj je schopný urobiť takéto niečo  malému dievčatku. Vykopať králika a dať ho späť do klietky...', 1271, 3.61, 55),
	(12432, 'Príde chlap do tetovacieho štúdia a vraví:\r\n- Chcel by som si dať vytetovať na chrbát PANNU.\r\nĽahne si a po troch minútach počuje:\r\n- Už.\r\n- Tak skoro? Myslel som si že to bude trvať dlhšie.\r\n- A to je taký problém vytetovať päť písmen?', 256, 3.24, 55),
	(12433, 'Pokémon vznikol na Záhorí...\r\nManželka je nahnevaná na syna a pýta manžela:\r\n- Po kém on  je?', 101, 3.12, 55),
	(12434, '- Ty sukin syn!\r\n- Ale mami...', 30, 3.46, 55),
	(12435, 'Telefonuje jeden muž do cestovnej kancelárie a pýta sa:\r\n- Prosím vás pekne, môžete mi povedať, ako dlho trvá let do New Yorku?\r\nTelefonistka odpovedá:\r\n- Okamžik prosím\r\nMuž: \r\n- Ďakujem vám pekne.', 213, 3.05, 55),
	(12436, 'Idú dvaja po ulici. Jeden sa spýta druhého:\r\n- Prosím vás, koľko je hodín?\r\nDruhý odvetí:\r\n- Za sedem minút.\r\n- Na koľko?\r\n- Neviem, mám iba veľkú ručičku.', 171, 3.17, 55),
	(12437, 'Rozprávajú sa dvaja novodobí gazdovia:\r\n- Počuj Laco, nemohla si tá tvoja dcéra zobrať môjho syna za muža? Vieš, aká by to bola partia?\r\n- Ivan, tvoj syn by sa jej aj pozdával, ale takú sviňu svokra by nezniesla!', 226, 3.13, 55),
	(12438, 'Dôjde muž k doktorovi a vraví :\r\n- Pán doktor, mám strašnú zápchu, už týždeň som nebol na WC.\r\n- Tu máte čípky a dôjdite o týždeň.\r\nMuž dôjde domov, rozdrví čípok, dá na lyžičku a zje.\r\nDôjde o týždeň :\r\n- Pán doktor, to vôbec nepomáha.\r\nDoktor vraví: \r\n- Človeče vy tie lieky snáď žeriete ? \r\n- Nie! Strkám si ich do zadku.', 365, 3.38, 55),
	(12439, '- Jožo, čo si jedol na raňajky?\r\n- Nič. \r\n- A ty?\r\n- Zvyšky po ňom.', 73, 3.18, 55),
	(12440, '"Prečo si dal výpoveď z tej továrne na výrobu výbušnín?"\r\n"Ále, boli to strašní skupáni! Po poslednom výbuchu mi strhli z výplaty čas, ktorý som strávil vo vzduchu..."', 184, 2.95, 55),
	(12441, 'Podozrivý muž v koženom kabáte vyzváňa pri dverách bytu. Otvorí mu 79-ročná starena a on na ňu spustí: \r\n"Kukučka dojí kravu na mesiaci a zelený orol pomiloval všetky lastovičky".\r\nŽenská najprv nechápavo stojí, potom sa otočí, zabuchne dvere a zakričí: \r\n"K špiónovi Ivanovi o poschodie nižšie".', 325, 3.23, 55),
	(12442, 'Jeden sa pýta druhého:\r\n"Čo by ste chceli radšej. 100 000 korún alebo 5 dcér?"\r\n"5 dcér."\r\n"A prečo?"\r\n"Lebo ich mám teraz 8."', 135, 3.15, 55),
	(12443, 'Pýta sa dedko svojej 12-ročnej vnučky.\r\n- Čo by si chcela dostať na narodeniny?\r\n- Menštruáciu!', 102, 3.08, 55),
	(12444, 'Chlapík si po dobrom obede trošku hlasnejšie prdol. Hanbil sa a tak teda trochu poškrípal stoličkou po zemi aby zakryl ten zvuk. Odrazu sa k nemu nakloní chlapík od vedľa a šepne:\r\n- Mm, úplne inakší zvuk, čo ?', 224, 3.43, 55),
	(12445, 'Stojí tučný chlap pred škôlkou.\r\nUčiteľka sa ho pýta. \r\n"Čakáte dieťa?"\r\nPán na to. \r\n"Nie to mám od piva."', 120, 3.15, 55),
	(12446, 'Jožko je na kúpalisku s rodičmi, zrazu sa na vlhkých kachličkách pošmykne, stratí rovnováhu a už-už sa dokaličí, ale v poslednej chvíli sa chytí otcovho pipíka a zachráni sa.\r\n- No vidíš, keby si bol s maminkou, tak máš rozbitú hlavu...', 258, 4.03, 55),
	(12447, 'Slovinca a Bosniaka ponúknu dvomi jablkami. Prvý si vyberá Bosniak a pravdaže, zoberie to väčšie. \r\n- Že sa nehanbíš! Brať si ten väčší kus. To vás v Bosne neučili bontónu? - rozčuľuje sa Slovinec\r\n- A keby si ti vyberal prvý, ktoré by si vybral?\r\n- To menšie pravdaže...\r\n- Však máš to menšie, zadrhni sa!', 334, 3.11, 55),
	(12448, 'Robotník padá z lešenia. Dobrý kamarát naňho kričí: \r\n"Fero, daj si ruky von z vreciek, aby to vypadalo ako pracovný úraz".', 133, 3.31, 55),
	(12449, 'Marienka sa pýta Janička:\r\n- Janíčko, ako viete koľko je hodín, keď vo vašom dome žiadne nevidím?\r\nA janíčko odpovedá:\r\n- No úplne jednoducho. Pozriem sa z okna na kostolnú vežu.\r\n- No fajn, ale ako to spravíš v noci?\r\n- Ešte judnoduchšie. Otvorím okno, vezmem trúbku, vykloním sa z okna a zatrúbim. A z ulice sa ozve "Ktorý imbecil vytrubuje o tretej hodine ráno?"', 391, 2.98, 55),
	(12450, 'Cikám cikám, fúka vetrík,\r\ncítim jak mi vlhne svetrík.\r\nJe to dážď a či rosa?\r\nAch do boha, ošťal som sa.', 117, 3.3, 55),
	(12451, 'Stretol som sa s Jožom. On bol sám ja s nožom. A s pomocou božou, už je menej Jožov.', 90, 2.97, 55),
	(12452, 'Koktavý nastupuje do autobusu, v ktorom sa kupujú lístky a hovorí:\r\n"PPPrrroosssííímmm ssiii jejejejejejeje....bem nnatto, iidemm ppeššo."', 147, 3.48, 55),
	(12453, 'Aký je rozdiel medzi slovenským a kanadským drevorubačom?\r\nŽiadny.\r\nKaždý si za týždeň zarobí na cestu do Bratislavy.', 128, 3.17, 55),
	(12454, 'Chlapík v lekárni hovorí: \r\n- Prosím si 3 šprcky!\r\nA lekárnička: \r\n- Preboha to nemôžete trochu tichšie? Je tu dáma.\r\nChlapík sa otočí a povie: \r\n- Jé, nazdar Božka. Tak prosím ešte jeden.', 206, 3.26, 55),
	(12455, 'Ľudia v čakárni pri lekárovi. Hrobové ticho. Zrazu si jeden pán "prdne". Aby to zakryl, drgne do stoličky, ktorá zavŕzga. Na to sa k nemu otočí staršia pani a vraví:\r\n- Úplne iný zvuk, že?', 204, 3.29, 55),
	(12456, 'Ak je moja žena zdravá, tak sú zdraví všetci chlapi v meste, a ak sú zdraví všetci chlapi v meste, tak sú zdravé aj všetky ženy v meste, no a ak sú zdravé všetky ženy v meste, tak som zdravý aj ja.', 214, 2.99, 55),
	(12457, '- Haló.\r\n- Prepáčte, je to číslo deväť, tri, štyri, tri, sedem, sedem, osem, päť, štyri?\r\n- Nie, áno, nie, áno, áno, nie, nie, áno, nie.', 151, 3.1, 55),
	(12458, 'Návšteva v zoo:\r\n- Videli sme tigra a robil pfff. \r\n- Nerobí tiger náhodou vrrr?\r\n- Aj to robí, ak je otočený papuľou. ', 127, 2.96, 55),
	(12459, 'Kedy je absolútna hmla?\r\nKeď policajt sedí na semafore a odtiaľ vykrikuje farby.', 84, 3.4, 55),
	(12460, 'Anamnéza: Kôň má kopol do vajec.\r\nDiagnóza: Trafil ho!', 59, 2.97, 55),
	(12461, 'Samovražda je najúprimnejšou formou sebakritiky.', 51, 3.15, 55),
	(12462, 'Hlásenie z dedinského rozhlasu:\r\nVlak odchádza o desať minút. Koniec oznamu. Opakujem, koniec oznamu.', 106, 2.9, 55),
	(12463, 'Rybár chytí zlatú rybku a ryba hovorí:\r\n- Keď má nezješ, splním ti 1 želanie. Ale tvoja svokra to bude mať dvakrát.\r\n- Chcem motorku.\r\n- Ale tvoja svokra bude mať dve motorky.\r\n- Hmmm nie. Chcem rodinný dom.\r\n- Ale tvoja svokra bude mať dva rodinné domy.\r\n- Hmmm nie. Ahááá, jedno vypichnuté oko. ', 316, 3.2, 55),
	(12464, 'Príde chlapík do ovocia-zeleniny a pýta sa predavača:\r\n"Prosím vás, čo je toto oranžové?"\r\n"To sú pomaranče, pane."\r\n"Tak si prosím 10 kg, ale odvážte mi každý pomaranč zvlášť."\r\nPredavač si pomyslí, že je to dobrý debil,ale urobil to. A chlapík sa pýta opäť:\r\n"Prosím vás a čo je toto žlté?"\r\n"To sú citróny, pane."\r\n"Tak mi dajte 15 kg, ale každý citrón mi odvážte zvlášť."\r\nPredavač si myslí: To je určite riadny debil, ale zákazník náš pán, takže urobil ako mu povedal.\r\nChlapík sa pýta opäť: \r\n"Prosím vás a čo je tamto v rohu, to čierne?" \r\nA predavač už úplne nahnevaný hovorí: \r\n"Prosím vás, na toto sa vykašlite, to je mak!"', 701, 3.37, 55),
	(12465, 'Chlapík zbadá dedka, ktorý šúcha za so sebou ľavú nohu. Pýta sa ho: \r\n- Od vojny, od vojny?\r\nDedko odpovedá: \r\n- Nie, od hovna, od hovna.', 146, 3.23, 55),
	(12466, '- Čo je? Čo sa stalo? Tváriš sa ako Švéd 9. mája.', 56, 2.85, 55),
	(12467, 'Idú Američan, Kanaďan a Slovák ako najlepší lukostrelci na svetovú súťaž. Potom postavia človeka a dajú mu na hlavu jablko. Prvý ide Američan vystrelí a povie:\r\n"I am Villiam Tell."\r\nIde Kanaďan vystrelí a povie:\r\n"I am Robin Hood."\r\nA nakoniec ide Slovák vystrelí a s radosťou povie:\r\n"I am sorry."', 319, 2.78, 55),
	(12468, 'Po púšti ide Slovák,Američan a Rus. Na smrť uťahaný sa vlečú. A zrazu Slovák začne utekať k ťave. Slovák sa vyškriabe na prvý hrb, Rus na druhý.\r\n"A ja mam kam ísť?", pýta sa Američan.\r\nRus nadvihol ťave chvost a povedal:\r\n"Idi v kabinu."', 260, 3.28, 55),
	(12469, 'Viete ktorý sval vás bolí, keď si robíte dobre?\r\nKrk. A viete prečo?\r\nLebo každú chvíľu pozeráte, či niekto nejde.', 126, 3.26, 55),
	(12470, 'Pristanú američania na mesiaci a hovoria: \r\n- HUSTON, HUSTON, na mesiaci sú Rusi a natierajú ho na červeno. \r\nHUSTON odpovedá:\r\n- To nie je možné, máte halucinácie. \r\nNa druhý deň zasa:\r\n- HUSTON, HUSTON, Rusi natreli už skoro celý mesiac na červeno. \r\nZrazu uvidia že je už mesiac celý červený a HUSTON odpovedá:\r\n- APOLLO, APOLLO, otvorte skrinku 182, tam je štetka a vápno. A na mesiac natrite COCA-COLA.', 430, 3.26, 55),
	(12471, 'Žena na piatom poschodí úplne nahá umýva okná. V tom sa okno preklopí a tá letí dolu a dopadne do kontajnera tak, že jej odtiaľ trčia roztiahnuté nohy. V tom ide okolo somrák, čo vyberá fľaše a hovorí si:\r\n"Á pivová fľaša za dve koruny, jéj vínová za šesť, to bude obedík", keď zrazu zbadá tú ženu. Pozerá pozerá, potom to preskúma prstamy, očuchá a hovorí si pre seba:\r\n"Čo tí dnešní ľudia už nevyhodia!!!', 451, 3.14, 55),
	(12472, 'Rádio Expres hlási: \r\n- Na Račianskej prechádza domov dôchodcov cez prechod pre chodcov. Zdržíte sa do desiatich minút. ', 128, 2.81, 55),
	(12473, '- Prosím vás, sú v Tatrách hady?\r\n- Vôbec by nemali byť. Minule tu boli nejakí odborníci a celé to tu odhadovali!', 122, 3.06, 55),
	(12474, '"Ako sa máš?"\r\n"Ja? Ja sa mám ako dvere, čakám kedy ma zavrú."', 68, 2.96, 55),
	(12475, ' Keď chodil  Neil  Armstrong  po  Mesiaci, nezanechal nám iba slávny výrok "Jeden krok pre človeka, ale ... atď", ale pripojil aj mnoho iných poznámok. Posledná z nich bola "Veľa štastia pán Gorsky". Po mnohé roky sa ho potom ľudia pýtali, čo mala ta poznámka o pánovi Gorskom znamenať. Až po dlhej dobe, keď pán Gorsky zomrel, konečne Armstrong uznal, že už môže podať vysvetlenie:\r\nKeď bol ešte dieťa a hrali sa s bratom s loptou, brat trafil muchu, ktorá dopadla na okno spálne Gorskych. Ako sa snažil muchu z okna vziať, počul ako pani Gorska kričí na manžela: \r\n- Orálny sex, tak ty chceš orálny sex? Orálny sex sa ti dostane, keď bude susedov chalan chodiť po mesiaci!', 719, 3.47, 55),
	(12476, '"Pozor, pozor.Našla sa kunda z Boženky.Opravujem.Bunda z koženky."', 69, 3.38, 55),
	(12477, 'Mládeži do 18 rokov nenalievať. Mládež je šikovná, naleje si sama...', 75, 3.44, 55),
	(12478, 'Do Národnej banky Slovenska nabúra rogalo. Pani, ktorá to celé pozorovala si hovorí:\r\n- Aký štát, taký terorista!', 122, 3.27, 55),
	(12479, 'Škót Mike si podal za libru LOTO. Večer v televízii zistil, že vyhral šesť miliónov. Ráno sa vyberie do podateľne a ukazuje tiket. Pán pri okienku mu gratuluje a zároveň vraví:\r\n- Prepáčte pane, ale nemôžeme vám dnes vyplatit celú výhru naraz. Dnes Vám vyplatime tri milióny a pozajtra ďalšie tri.\r\nMike sa naň namosurene pozrie a vraví:\r\n- Ak si myslíte, že so mnou budete vydrbávať, tak to teda nie! Vráťťe mi moju libru!', 457, 2.7, 55),
	(12480, 'Zlodej sa vlúpe do domu, rabuje. Keď zrazu začuje boha:\r\n"Nekradni, není to správny čin."\r\nKradne ďalej, tak znova:\r\n"Ježíš te vidí, on te vidí.Ježíš te vidí.Ježíš je pitbul!"', 194, 2.63, 55),
	(12481, 'Rusi poslali telegram Čechom:\r\nSte dobrý hokejový tím STOP.\r\nBoli ste rovnocenným súperom STOP.\r\nGratulujeme STOP.\r\nRopa STOP.\r\nZemný plyn STOP .', 152, 3.42, 55),
	(12482, 'Príručka na prežitie pre nižší management:\n\r\n1) Kvôli srande sa opýtaj na riešenie problému najsprostejšieho kolegu.\r\n2) Žiadaj si právnu konzultáciu, ktorá problém zmrazí na neurčito.\r\n3) Navrhni riešenie, ktoré potopí celý projekt ktorého sa problém týkal.\r\n4) Stuhni a predstieraj smrť, keď problém pominie povedz, že si len rozmýšľal nad riešením.\r\n5) Nezabúdaj, že "voľná ruka" je len pomsta nadriadeného.\r\n6) Demonštratívne študuj stratégiu firmy a tvár sa prekvapene, že neobsahuje riešenie na vzniknutú situáciu.\r\n7) Konaj nekompetentne až kým niekto nespanikárči a nevyrieši problém za Teba.\r\n8) Založ problém dokiaľ sa v rámci reorganizácie nepresunie na niekoho iného.\r\n9 )Vráť sa k bodu 1.', 763, 3.19, 55),
	(12483, 'Na diskotéke príde chlapec ku dievčaťu a pýta sa:\r\n- Nejdeš si zatancovať?\r\nDievča celé rado odpovedá:\r\n- Ale samozrejme, idem...\r\n- Tak choď, lebo si nemám kde sadnúť!', 182, 3.34, 55),
	(12484, 'Námorník v reštaurácii.\r\n- A toto je čo?\r\nČašník:\r\n- Prosím polievka.\r\nNámorník:\r\n- Tisíc rohatých! Dvadsať rokov sa plavím v polievke a ani o tom neviem.', 169, 2.95, 55),
	(12485, 'Slepec chce prejsť cez cestu a preto hľadá niekoho kdo by ho previedol\r\n"Pane,mohli by ste ma previest cez cestu?"\r\n"Ale ja kokokokcem."\r\n"Nevadí stačí keď poviež že môžeme a ja pôjdem."\r\nTak idú cez 1 cestu .\r\n"Môžeme?"\r\n"Momomomomomožeme."\r\nBez problémov prejdú.Idú cez 2.cestu.\r\n"Môžeme?"\r\n"Momomomomomomomomôžeme."\r\nTiež hladko prejdú,ale este je tu 3.cesta.\r\n"Je voľno?"\r\n"Momomomô."slepec nečaká a ide ."momodrý kamión."', 457, 3.07, 55),
	(12486, 'Traja zamestnanci veľkej firmy sa rozprávajú, čo urobia s vianočnými odmenami. Prvý vraví:\r\n- Pracujem pre divíziu v Nemecku, z vianočných odmien si kúpim auto a za zvyšok pôjdem na dovolenku.\r\nDruhý vraví:\r\n- Pracujem pre divíziu vo Švajčiarsku, za vianočné odmeny si nechám vybudovať bazén a za zvyšok pojdem na cestu okolo sveta.\r\nTretí vraví:\r\n- Pracujem pre divíziu na Slovensku a za vianočné odmeny si kúpim pulover.\r\nOstatní sa prekvapene pýtajú:\r\n- A čo zvyšok?\r\nTretí vraví:\r\n- Zvyšok mi doložia rodičia.', 554, 3.29, 55),
	(12487, 'Vo Vranove na železničnej stanici sa z ampliónu ozve:\r\n"Tururu, tururu vlak do Košíc príde za 10 minút."\r\nO 5 minút opäť :\r\n"Tururu, tururu vlak do Košíc príde o 5 minút."\r\nO 4 minúty opäť :\r\n"Tururu, tururu vlak do Košíc príde o 1 minútu."\r\nZrazu sa ozve hrozný rachot a z ampliónu sa ozve :\r\n"Hlupáci, však som vám povedal ,že tu rúru máte dať preč z koľajníc."', 396, 2.93, 55),
	(12488, 'Stretnú sa dvaja nájomní vrahovia a jeden hovorí:\r\n- Počuj kámo, dnes je to s tou robotou pre nás nejaké biedne. Keby neprišla svokra, tak normálne vyjdem z cviku.', 173, 3.04, 55),
	(12489, 'Cestuje žena vo vlaku a v náručí drží dieťa. Oproti spi chlapík, ktorý sa počas cesty zobudí a skričí:\r\n- Bože, ale som sa zľakol! Fuj, to je hnusné dieťa! Je také odporne, že musím ísť zvracať!\r\nA beží preč. Žena začne plakať. Prisadne si k nej iný muž a začne ju utešovať:\r\n- Pani neplačte, to bude v poriadku. Pozrite sa, vám dám vreckovku, opici dám oriešky!', 401, 3.46, 55),
	(12490, 'Dievča čo jej strašne smrdí z úst,chce íst na diskotéku. Ide za mamou a pýta sa jej,že čo má robiť,keď sa jej niekto ničo opýta. Mama jej hovorí, že nech len kýve hlavou.Dievča teda ide. Zrazu sa s ňou začne rozprávať jeden chalan.\r\n"Si tu prvý raz?"\r\nKývne hlavou že hej.\r\n"A páči sa ti to tu ?"\r\nKývne hlavou že áno.\r\n"Koľko máš rokov?"\r\n"Osemnásť."\r\n"Fuj ty si si prdla?"\r\n"Nie."\r\n"A teraz?"', 430, 3.26, 55),
	(12491, 'Sused zvoní u suseda a hovorí mu:\r\n- Spal som s tvojou ženou, v akom vzťahu teraz budeme?\r\nSused kľudne:\r\n- V žiadnom, sme si kvit!', 137, 2.94, 55),
	(12492, 'Ide autobus s postihnutými deťmi a zrazu sa pokazí. Vodič vyjde von, otvorí kapotu a pokúša sa ten autobus opraviť. Dve hodiny sa mu to nedarí a potom príde ku nemu postihnuté decko a hovorí.\r\n- Ujo, ja viem, čo je s autobusom.\r\nVodič hovorí:\r\n- Ty si debil, ty nič nevieš.\r\nPo štyroch hodinách príde k vodičovi ďalšie decko a hovorí:\r\n- Ujo, ja viem, čo je s autobusom.\r\n- Choď preč, choď preč, ty nič nevieš.\r\nO šesť hodín, keď je už vodič nasratý a nedarí sa mu opraviť autobus čaká na ďalšieho paka.\r\nO chvíľu nato príde ďalší pako a hovorí:\r\n- Ujo, ja viem čo je s tým autobusom.\r\nA vodič sa ho pýta:\r\n- No čo je s tým autobusom?\r\n- Autobus je pokazený, pokazený,pokazený.', 737, 3.18, 55),
	(12493, 'Zazvoní zvonček.\r\n- Kto je?\r\n- Sused\r\n- A čo chcete, človeče, takto neskoro v noci?\r\n- Máte cesnak?\r\n- Nemáme!\r\nAsi za pol hodiny zvoní zvonček znovu.\r\n- Kto je?!\r\n- Sused.\r\n- A čo zasa chcete?!\r\n- Nič, nesiem vám cesnak.', 233, 3.11, 55),
	(12494, 'Fero stretne Joža:\r\n"Čau,Jožo.Tak čo,ako sa más?"\r\n"Dobre.Včera mi višiel jeden článok."\r\n"Článok? Veď ja som si myslel,že si automechanik."\r\n"Veď to aj som,ibaže mám pásovnicu."', 195, 2.91, 55),
	(12495, 'Novinár sa pýta afričana, prečo vlastne boli celé roky pod nadvládou cudzích mocností. \r\n- Viete, to je tak. My sme mali pôdu, prišli misionári a oni mali bibliu. Potom nás naučili modliť sa zo zatvorenými očami. No a keď sme ich otvorili, oni mali pôdu a my bibliu.', 284, 3.04, 55),
	(12496, 'Traja chlapi sa rozprávajú, aké najhoršie zvuky počuli v živote. Američan hovorí:\r\n- Letím si v lietadle a zrazu mi začne kašlať jediný motor. Stráca otáčky, hapruje. Chlapi a to bol ten najhorší zvuk v živote, čo som počul. \r\nRus sa usmeje:\r\n- Ja som zažil horší. Vyjdem si takto ráno na ryby, vyvŕtam do ľadu dierku, nahodím a čakám. Asi som zdriemol, lebo keď som sa zobudil, všade naokolo som počul praskanie ľadu.\r\nSlovák sa len zasmeje:\r\n- Tomu hovoríte strašné zvuky? To ja som takto šustal vydatú paničku a vtom sa vrátil jej manžel domov. Samozrejme, vyskočil som cez otvorene okno do záhrady. Lenže ten chlap bol strašne rýchly a zdrapol ma oboma rukami za gule...\r\n- A kde je ten zvuk? - pýta sa Rus s Američanom.\r\n- Veď práve. Drží ma on, drží, a vtom počujem, ako sa pokúša zubami otvoriť vreckový nožík...\n', 883, 3.21, 55),
	(12497, 'Na tancovačke sa chlapík stále lepí na peknú slečnu a nahovára ju na sex. Tá hovorí:\r\n- Neotravujte. Nič nebude. Nie teraz. Nie tu. Sakra, chlape nie TAM!', 164, 3.03, 55),
	(12498, 'Smradľavý otrhaný bufeťák si prisadne v parku na lavičku ku krásnej slečne. Poočku ju pozoruje a potom ju ponúkne z nedopitej fľaše piva.\r\n- Dajte mi pokoj s tým pivom! - pohoršuje sa slečna.\r\nBufeťák siahne do vrecka a vytiahne uváľaný, chlpmi polepený cukrík a ponúkne ho kočke.\r\n- Už som vám raz povedala, aby ste neotravovali!!! - zreve dievča.\r\nBufeťák pokýva hlavou a zamyslené prehodí:\r\n- Hm, tak o sexe asi ani začínať nemusím...  ', 475, 2.77, 55),
	(12499, 'Prídu indiáni za náčelníkom a pýtaj  sa:\r\n"Aká bude zima? Máme rúbať drevo?"\r\nNáčelník nevie a tak pobie:\r\n"Rúbte drevo!"\r\nPre istotu ale zavolá do meterologického ústavu a pýta sa aká bude zima.A oni mu odpovedajú:\r\n"Pravdepodobne tuhá,lebo indiáni rúbu drevo!"', 285, 3.4, 55),
	(12500, 'Muž u veštice: \r\n- Môžem ku vám prísť aj v piatok? \r\n- Nie, v stredu vás zrazí auto.', 93, 3.33, 55),
	(12501, 'Manželia sa zobudia ráno o tretej na hluk pri dverách. Muž vstane a ide otvoriť. Vonku stojí opilec a hovorí:\r\n- Potrebujem potlačiť.\r\n- Nie - odpovie manžel - je tri hodiny ráno.\r\nZabuchne dvere a vráti sa do postele.\r\n- Kto to bol? - pýta sa žena.\r\n- Nejaký opilec amatér. Chcel potlačiť.\r\n- A pomohol si mu?\r\n- Samozrejme, že nie. Je tri ráno a prší.\r\nŽena nalieha.\r\n- Veď si spomeň. Mesiac dozadu nám na sviatky v núdzi pomohli tí dvaja páni. Myslím, že si mu mal tiež pomôcť“.\r\nMuž sa teda oblečie a vráti sa pred dvere.\r\n- Ste ešte tam? - zakričí do tmy.\r\n- Áno - odpovedá opilec.\r\n- A kde ste? Nevidím vás.\r\n- Tu na hojdačke.', 679, 3.5, 55),
	(12502, 'Dedinský bál.\r\n- Mara, poď si zatancovať!\r\n- Nejdem, Jano.\r\n- Mara, poď tancovať, kúpim ti prstienok.\r\n- Nejdem.\r\n- Nerob drahoty, kúpim ti šatôčku.\r\n- Nejdem, vravela som.\r\n- Sto hrmených ti do duše, poď, lebo ti bohuotcuprisahám takú tresnem po papuli, že všetky zuby vypľuješ!\r\n- Keď ma tak pekne prosíš, tak teda idem.', 345, 3.4, 55),
	(12503, 'Rozprávajú sa dvaja susedia:\r\n- Tak čo? Už viete kam idete na dovolenku?\r\n- Áno. Ideme do San Juan.\r\n- Ale to sa číta San Chuan lebo Španieli čítajú J ako Ch. A kedy teda idete?\r\n- Ále, koncom chúna a začiatkom chúla.', 232, 3.33, 55),
	(12504, 'Dvaja kámoši sa stretnú a jeden hovorí druhému: \r\n- Tak čo? Kam sa chystáš na dovolenku?\r\n- Ale ideme s rodinou do Afriky na safari.\r\n- Vieš čo, nechoď tam. Taký leopard - sedí na strome, zoskočí na teba, odhryzne ti ruku ani si nepípneš.\r\nPo dovolenke sa stretnú a ten prvý má protézu - drevenú ruku aj s námorníckym hákom a hneď hovorí: \r\n- Vieš čo, mal si pravdu. Leopard na mňa skočil a mám po ruke ale nevadí, na rok idem na Amazonku na ryby.\r\n- Nechoď tam, stúpiš na aligátora, ten sa vymršťí z vody a odhryzne ti nohu prv, než sa spamätáš.\r\nPo ďalšej dovolenke sa stretnú a ten prvý teda miesto ruky hák, miesto nohy drevená protéza, a už z dialky kričí na druhého: \r\n- Mal si pravdu aligátor, ale nič to, už mám zaplatenú dovolenku v Himalájach.\r\n- Ty už ma počúvaj - taký orol skalný, spustí sa strmhlav z výšky na teba, vyklobne ti oko ani nemrkneš.\r\nSamozrejme po dovolenke sa stretnú - na oku páska, oko sklenené: \r\n- Tak čo, zasa som mal pravdu? Orol skalný?\r\n- Ale nie. Vieš leziem hore po tej skale, pozerám či nejaký ten orol neletí, a v tom mi padol do oka kamienok. No a ja v tom háku ešte nemám taký cit ... ', 1211, 3.04, 55),
	(12505, 'Hovorí černoch belochovi: \r\n- Ja keď sa narodím, som čierny. Keď sa zobudím, som čierny. Keď sa opálim, som čierny. Keď zomriem, budem čierny. No ty, keď sa narodíš, si ružový. Keď sa zobudíš, si biely. Keď sa opáliš, si červený. Keď ti je zle, si zelený. Keď zomrieš, budeš fialový. A ty máš tu drzosť nazývať má farebným?', 362, 3.54, 55),
	(12506, 'Dedko sa sťažuje v domove dôchodcov: \r\n-Neprekáža mi, keď mi stará pije môj alkohol, fajčí moje cigarety, ale keď sa pri obede na mňa usmeje mojimi zubami, to je na mňa priveľa!', 191, 3.29, 55),
	(12507, 'Mama číta inzerát v novinách:\r\n"Sympatický muž s vilou, bazénom tromi autami a tridsaťročnými úspormi hľadá milé dievča na bližšie zoznámenie."\r\nMama ihneď poslala svoju dcéru za týmto mladíkom. Keď príde dcéra domov zo svojho rande, mama sa netrpezlivo pýta:\r\n- No, aký bol?\r\n- Bol aj sympatický, aj vilu s bazénom mal.\r\n- A autá?\r\n- Aj auta mal.\r\n- A čo tie tridsaťročné úspory?\r\n- Dokonca ešte teraz mi stekajú dole stehnami!', 465, 3.31, 55),
	(12508, 'K pultu v prodejně tabaku pristoupí muž a zadá si polobotky číslo 42.\r\n"Promiňte,ale mi zde prodávame jen potreby pro kuřáky."\r\n"No a vy si myslíte,že kuřáci snad chodí bosí?"', 191, 3.11, 55),
	(12509, 'Ocko uspáva malú Katku, Katka hovorí:\r\n- Ocko, mohol by si mi pošepkať to, čo šepkáš mamičke, keď ju uspávaš?\r\nOcko sa prikloní k jej ušku a tichúčko povie:\r\n- Šu-šu-šu...\r\nKatka na to:\r\n- Dnes nie! Som hrozné unavená...', 242, 3.39, 55),
	(12510, 'Na súde... Sudca sa pýta:\r\n- Pán navrhovateľ , prečo sa chcete s manželkou rozveisť?\r\n- Ehm, no, pretože mi sexuálne nevyhovuje.\r\n- To je ale sprostý vagabund, ozve sa na to z preplnenej sály. Všetkým vyhovuje, len jemu nie!', 237, 2.79, 55),
	(12511, 'Matka mi vynadala, že som sukyn syn.!', 38, 3.01, 55),
	(12512, '"Jano,včera si bol zase spitý ako teľa."\r\n"Tak teraz už viem,prečo som dnes smädný ako vôl."', 100, 2.87, 55),
	(12513, 'Prečo sa ľudia chytajú za gombík,keď vidia kominára?\r\nKeby sa cigáni chytali za niečo iné vyzerali by ako Michael Jackson.', 131, 2.55, 55),
	(12514, 'Do krčmy príde mladá dievčina v šatách s ramienkami. Ako ináč, zabudla si oholiť podpazušie.Zdvihne ruku, aby privolala vrchného, a objedna si martini. Keď dopije, objedná si ešte jedno, potom ďaľšie.\r\nPopri tom ju sleduje podnapitý maník od vedľajšieho stola. Po chvíli privolá vrchného:\r\n"Prosím vás, dajte tej baletke na môj účet ešte jedno martini."\r\n"Vy ju poznáte?"\r\n"Nie."\r\n"A odkiaľ viete, že je baletka?"\r\n"Lebo hentak vysoko zdvihne nohu iba baletka, nie?"', 499, 3.33, 55),
	(12515, 'Údolím ide vlak. 130 km/h. Zrazu začne prudko brzdiť a na dvoch metroch zastane. Ľudia popadajú, začnú nadávať. Sprievodca beží z kupé do kupé, pozerá kto potiahol za ručnú brzdu. Nevie nikoho nájsť. Zrazu otvorí dvere WC v poslednom vozni. Vidí muža sedieť na mise a takto mu povie:\r\n"Za používanie záchodu, keď vlak nie je v pohybe zaplatíte pokutu 200 Sk."\r\n"Dám vám tri stovky, ak vyberiete moje gule z výhybky."', 447, 3.54, 55),
	(12516, 'Robotník padá z lešenia a spolupracovníci naňho zhora kričia:\r\n- Fero, pridaj, letí za tebou tehla!', 106, 3.11, 55),
	(12517, 'Dievča hovorí svojmu chalanovi. Príď zajtra nikto nebude doma.\r\nChalan príde,zvoní a nikto nie je doma.', 109, 3.39, 55),
	(12518, 'V kine:\r\n"Dajte tú ruku preč z môjho kolena!"\r\n"A kam ju môžem dať?"\r\n"O kus vyššie!"', 93, 3.15, 55),
	(12519, '- Do zadku, od nového roku zdražie chlast. - hovorí jeden chlapík druhému.\r\n- No čo už, budeme musieť menej jesť!', 122, 3.03, 55),
	(12520, 'Príde dcéra z diskotéky a mama sa jej pýta:\r\n- Tak čo, tancovala si?\r\n- Tacovala.\r\n- A boli tam nejakí chlapci?\r\n- Boli.\r\n- Aj si sa s nimi rozprávala?\r\n- Rozprávala.\r\n- No, a čo ti povedali? \r\n- Uhni debil!  ', 218, 2.56, 55),
	(12521, 'Ide Arab po púšti a desať metrov pred ním ide jeho žena.Príde za ním druhý arab a vraví mu: \r\n"Čo to robíš veď v koráne je jasne napísané,že žena má ísť za svojím mužom."\r\n"To je pravda ,ale keď sa písal korán tak vtedy ešte nepoznali nášľapné míny."', 282, 3.2, 55),
	(12522, 'Príde chlapík do baru a vraví:\r\n"Dajte mi deväť fliaš whiskey  a ja ich všetky exnem."\r\nBarman mu spraví po vôli a on ich vážne exne.\r\n"To bolo super, kto si?"\r\n"Ja som whiskey-bill!"\r\nO pár dní dôjde daľší chlapík a vraví:\r\n"Postavte mi všetky biliardové gule na stôl a ja ich všetky schovám na jeden šťuch."\r\nTak sa stane a on ich vážne všetky trafí do dier na jeden šťuch.\r\n"Pecka, kto si ty?"\r\n"Ja som biliard-bill!"\r\nO pár dní dôjde tretí chlapík a vraví:\r\n"Ja mám troch pipíkov."\r\n"Ukáž!"\r\nChlapík rozopne gate a tam má vážne tri údy.\r\n"Wow, a kto si ty?"\r\n"Ja som černobyl!"', 629, 3.14, 55),
	(12523, 'Unudená slečna pri bare si vzdychne:\r\n- Ak sa do polnoci nedostanem do postele, tak sa idem vyspať domov.', 108, 2.93, 55),
	(12524, '- Ty, predstav si, včera som spadol z rebríka.\r\n- A nestalo sa ti nič?\r\n- Nie.  Predstav si, včera som spadol z rebríka.', 125, 3.57, 55),
	(12525, 'Sprievodkyňa sprevádza Vietnamcov po Prahe. Aby sa zdokonalili v češtine, dohodli sa, že budú po nej opakovať všetko, čo povie.\r\n"Tohle je Karlúv most."\r\n"Tochle je Karluv most."\r\n"Tohle jsou Hradčany."\r\n"Tuchle jsou Chradšany."\r\nPrišli tak do jednej úzkej uličky, na konci ktorej prášil Čech o plot mladú Vietnamku.V rozpakoch, aby situáciu zachránila, sprievodkyňa hovorí:\r\n"Pán jede na kole."\r\n"Pan jede na kole."\r\nZrazu zo skupiny vystúpi jeden Vietnamec a prenesie:\r\n"To je moje kolo."', 515, 3.08, 55),
	(12526, 'Sedem divov socializmu:\r\n- Každý mal prácu.\r\n- Hoci mal každý prácu, nikto nič nerobil.\r\n- Hoci nikto nič nerobil, plán sa plnil nad 100%.\r\n- Hoci sa plán plnil nad 100%, nikde ničoho nebolo.\r\n- Hoci nikde ničoho nebolo, predsa mal každý všetko.\r\n- Hoci mal každý všetko, predsa všetci kradli.\r\n- Hoci všetci kradli, nikdy to nikde nechýbalo.', 363, 3.25, 55),
	(12527, 'Muž telefonuje manželke:\r\n"Mám pre teba dobrú správu vyhral som milión."\r\n"A ja mám pre teba zlú správu zomrela mi mama."\r\n"Keď sa darí,tak sa darí. "', 162, 3.63, 55),
	(12528, 'Doma pri večeri:\r\n"Počúvaj Klaus ráno sa mi susedka chválila,že jej manžel má pod sebou 3 000 ľudí. Môže to byť pravda?"\r\n"Môže,on totiž kosí trávu na cintoríne."', 181, 3.12, 55),
	(12529, 'Reálny život je iba špeciálny prípad, keď sú všetky imaginárne zložky nulové.', 88, 3.33, 55),
	(12530, 'V hotelovej izbe zvoní telefón.\r\n"Prosím ?" Odpovedá ospatým hlasom hosť !\r\n"Dobré ráno, tu hotelová služba. Žiadali ste sa zobudiť o 6:30 ??"\r\n"Áno."\r\n"No tak šup, šup už je jedenásť !"', 204, 3.5, 55),
	(12531, 'Prijde Mara do domu a hovorí svojmu mužovi:\r\n"Ty Ďuro, ten náš baran je akýsi smutný! Nemali by sme ho radšej zabiť?"\r\n"Ak si myslíš že ho to rozveselý ?"', 167, 3.18, 55),
	(12532, 'Jde turista Afrikou a najednou potká domorodce.Domorodec se ho ptá:\r\n"Smrt nebo Bongo-bongo?" \r\nTurista si řekne:\r\n"Tak to radší to bongo-bongo."\r\nTak ho domorodec opícha zezadu a odejde. Turista jde dál a najednou potká 2 domorodce a ti se ho zas ptají:\r\n"Smrt nebo bongo-bongo?" Turista si zas řekne - furt lepší dvakrát bongobongo než smrt. Tak další dva čísla zezadu a odejdou. Tak jde turista dál - trochu udýchanej a najednou potká skupinu 50-ti domorodcú:\r\n"Smrt nebo bongo-bongo?"\r\nTurista celej dodelanej:\r\n"To radši tu smrt."\r\n"Zemrešs smrtí BONGO-BONGO!"', 590, 3.02, 55),
	(12533, 'Príde kovboj do šenku a zreve:\r\n"Kto mi natrel koňa na zeleno?"\r\nPrihlási sa medveď.Kovboj hovorí:\r\n"Už uschol, môžeš ho ísť nalakovať."', 149, 3.01, 55),
	(12534, 'Naskočí kovboj do autobusu a kričí:\r\n"Jim nikdy neplatí!"\r\nŠofér sa čuduje a hovorí, prečo by nemal platiť?\r\n"Jim nikdy neplatí!"\r\n"Jak neplatí, musí!"\r\n"Jim nikdy neplatí!"\r\n"Jim má mesačník!"', 211, 3.01, 55),
	(12535, 'Viete aký je rozdiel medzi slovenským, francúzskym a švédskym dôchodcom?\r\nŠvédsky ráno vstane, dá si švédske raňajky a ide si zahrať tenis. Francúzsky sa zobudí, dá si francúzske raňajky a ide si zahrať golf. Slovenský sa ráno zobudí, dá si švédske kvapky, zoberie si francúzske barle a ide na míting. ', 330, 3.06, 55),
	(12536, 'Čo hovorí magnet magnetke?\r\nTy ma ale priťahuješ.', 53, 2.95, 55),
	(12537, '50 ročná matka prišla nečakane domov. Z obývačky počula zvláštne zvuky, šla sa pozrieť a našla tam svoju 30 ročnú dcéru sedieť na gauči s robertkom v ruke. Na otázku, čo to robí, dcéra odpovedala : \r\n- Som stará, škaredá a žiadny muž ma nechce. Tak toto je môj manžel, ktorý uspokojí moje sexuálne potreby.\r\nNa druhý deň prišiel za podobných okolností domov otec a situácia sa zopakovala. Tretí deň prišla matka domov, vošla do obývačky a tam sedel otec. V jednej ruke držal pivo, v druhej robertka a pozeral na televízor. Na otázku, čo to robí odpovedal:\r\n- Ale tuto so zaťom pozeráme televízor.', 647, 3.2, 55),
	(12538, 'Bošácky kopaničiar prišiel k lekárovi. Sťažoval sa, že ho veľmi bolí žalúdok. Lekár sa ho pýta:\r\n- Akú máte stolicu?\r\n- Trenčiansku,-odvetil kopaničiar.', 170, 2.64, 55),
	(12539, 'Príde chlap do krčmy a pýta sa:\r\n"Má tu niekto čierneho psa s bielim obojkom?"\r\nNikto sa neozve a tak zašomre:\r\n"Do kelu, tak to som zrazil farára!"', 155, 3.02, 55),
	(12540, 'Do salónu vbehne kovboj a volá na farmára:\r\n"Vašu ženu nabral na rohy býk!"\r\nFarmár nič.\r\n"Počujete? Vašu ženu nabral na rohy býk!"\r\n"Ano, počujem, ale bolí ma zub, nemôžem sa smiať!"', 200, 3.3, 55),
	(12541, 'Zvoní telefón:\r\n"Prosím Vás,Fero je doma?"\r\n"Áno,ešte odnesli len vence."', 79, 3.39, 55),
	(12542, 'Peťo žije na vidieku a Jano v meste. Raz sa Jano rozhodol, že navštívi Peťa. Príde a tam na  dvore všade samé kury. Peťo ho privíta a podotkne: \r\n- Veľa sliepok, čo?\r\nJano prikývne a povie:\r\n- Veru, celé stádo!', 226, 2.64, 55),
	(12543, 'Mladý, pekný muž si ide dať vyveštiť starej cigánke. Cigánka mu vyveštila dlhy spokojný život. Cigánka zhrabla peniaze a muž odišiel. Keď prechádzal cez cestu domov, zrazilo ho auto. Cigánka si len vzdychne:\r\n- Bože, ako ten čas letí!', 254, 3, 55),
	(12544, 'Rozprávajú sa dvaja česi:\r\n"Poslal sem ženu pro brambori a prešlo ji auto."\r\n"A čo budeš dělat?"\r\n"No asi udelám rejži."', 130, 3.11, 55),
	(12545, '"Pán vrchný, volám vás, pán vrchný! "\r\n"A čo si prajete?" \r\n"Dve pivá na účet volaného!"', 99, 3, 55),
	(12546, 'Dvaja lupiči idú vylúpiť trezor, ktorý je na 50 poschodí. Lenže výťah sa pokazil a oni musia ísť pešo. Keď sú na 20 poschodí, ten koktavý hovorí:\r\n- Do pipipi...\r\nTen druhý mu hovorí:\r\n- Ale veď nehreš už sme skoro tam.\r\nKeď už sú na 40 poschodí, ten koktavý zasa hovorí:\r\n- Do pipipi...\r\nA ten druhý zasa:\r\n- Veď nehreš už sme skoro tam.\r\nKeď sú už na tom 50 poschodí, ten koktavý zasa:\r\n- Do pipivnice mi spadol kľúč.', 459, 2.73, 55),
	(12547, 'Je noc. Na lavičke v parku spí tulák. Okolo prechádza párik. Muž potľapká po pleci tuláka a pýta sa: \r\n- Prosím vás, neviete koľko je hodín?\r\nTulák sa zobudí nahnevaný: \r\n- Neviem, nemám hodinky.\r\nZaspí a o pol hodinu prejde okolo nejaký chlap, zobudí tuláka a pýta sa to isté. Tulák odpovie, že nevie. Je už poriadne nahnevaný, tak si vezme pero a papier a napíše: "Neviem, koľko je hodín." A opäť zaspí. O ďalšiu polhodinu prechádza okolo ďalší človek, prečíta si odkaz, zobudí tuláka a povie mu: \r\n- Je 2.30, pane.', 563, 3.2, 55),
	(12548, 'Mladý ale frajerský pilot ide na svoje prvé samostatné nočné pristátie. Namiesto obvyklého ohlásenia sa dispečerovi letiska zavalí do vysielačky: \r\n- Hádaj kto?\r\nDispečer vypne svetlá celej pristávacej dráhy a letiska a odpovie: \r\n- Hádaj kade?', 262, 3.32, 55),
	(12549, 'Leží si gulášová polievka kľudne v žalúdku a zrazu padne do nej vodka, o chvíľu druhá vodka, tretia, štrvrtá, piata, šiesta a po siedmej si gulášová polievka hovorí:\r\n"Ej,tam bude párty,tam sa pôjdem pozriet."', 229, 3.26, 55),
	(12550, 'Redaktor jedné nejmenované televize se rozhodl vytvořit reportáž o tom, jak se žije lidem na horách. Přijel do horské vesnice a oslovil staršího muže, který se opíral o ohradu pro kone a žvýkal stéblo trávy. Vysvetlil mu svúj problém a požádal ho o nejakou veselou príhodu ze života:\r\n"Veselou príhodu ? Ted si vzpomínám, že jednou se sousedovi Tondovi ztratila ovce. Všichni chlapi z vesnice ji šli hledat. Po dvou dnech ji našli. Ze samé radosti se opili a s nalezenou ovečkou si užili."\r\n"No, to je pekná príhoda, ale to nemohu použít. Zkuste si prosím vzpomenout na jinou prihodu."\r\n"Jinou ? Dobrá, vzpomínam si, jak se jednou sousedovi Pepovi ztratila manželka. Všichni chlapi z vesnice ji šli hledat, po dvou dnech se s ní vrátili do vesnice. Ze samé radosti se opili a s ženou Pepy si užili."\r\n"Sakra, sakra. To take nemohu použít. Zkusme to z jiné strany. Vzpomente si na nejakou smutnou příhodu z Vašeho života."\r\n"Smutnou ? No. Jednou jsem se ztratil ja."', 1021, 2.99, 55),
	(12551, 'Cikám cikám, fúka vetrík, ožltol mi biely svetrík.\r\nJe to dáždik a či rosa?\r\nEj do zadku, ošťal som sa.', 114, 3.04, 55),
	(12552, 'V kine:\r\n- Pane, ste taký tučný, že by ste si mali kúpiť lístok na dve miesta! \r\n- Veď som si kúpil! Ale druhé miesto mám na balkóne!', 145, 2.54, 55),
	(12553, 'Ide dedko taxíkom. O chvíľu dedko vystúpi a vodič mu hovorí:\r\n- Tak, bude to dvesto korún.\r\nDedko:\r\n- Synak, mňa neoblafneš, viezol si sa aj ty.', 153, 3.01, 55),
	(12554, 'Družstevník spadol pri milovaní z postele a zlomil si ruku.Aby mu nato manželka neprišla,že ju podvádzal podplatil doktorov,ktorý opísal túto tragédiu ako pracovný úraz: Spadol pri sejbe semena zo starej mašiny.', 225, 3.17, 55),
	(12555, 'Pepa utrpí na stavbě těžkou nehodu, při které přijde o obě uši. Když se má vrátit z nemocnice, mistr všechny svolá a upozorňuje zejména Honzu, bývalého to policajta, ale i ostatní, aby byli na Pepu hodní, že to těžce nese, aby mu to nepřipomínali. Pepa je první den zas v práci, dělají s Honzou a ten neví, na co by zavedl řeč, aby kolegovi zvednul náladu. Tak povídá:\r\n"Koukám, že se ti zlepšil zrak, co?"\r\n"Jo? Proč myslíš?"\r\n"No, že už nenosíš brejle."', 500, 2.99, 55),
	(12556, 'Profesor chemie chtěl v osmičce žákům demonstrovat negativní vlivy alkoholu. Přinesl sklenici vody, sklenici whisky a dva červíky.\r\n"Teď pozorně sledujte ty červíky."\r\nDo sklenice s vodou vložil jednoho červa. Ten se čile pohyboval, spokojený, jak jen může červ ve vodě být. Do druhé sklenice vložil druhého červa. Ten se začal zuřivě kroutit a po pár vteřinách klesl na dno nehybný.\r\n"Tak, co nám z tohoto pokusu vyplývá?"\r\nPepík, který samozřejmě seděl v poslední lavici, se hlásí:\r\n"Pijte whisky, nebudete mít červíky."', 569, 3.2, 55),
	(12557, 'Do kožušníckej firmy príde chlapík, ktorý im vraví, že podľa dotyku rozozná druh kožušiny a vie k nej aj aktuálnu cenu kožucha. Kožušníkom to nedá a idú ho vyskúšať. Zaviažu mu oči a chlapík postupne hovorí:\r\n"Líška polárna, 15600,-."\r\nKožušníci uznanlivo pokývajú hlavou a dajú mu ďalšiu.\r\n"Norok americký, 25200,-."\r\nChlapov to už nahnevá a chcú ho na niečom nachytať. Tak mu privedú nahú ženu a ruku mu položia do jej rozkroku. A chlapík na to:\r\n"Potkan šedý, 6,50."', 519, 3.14, 55),
	(12558, 'Ženská měla v posteli milence, když v tom slyší, jak na príjezdové ceste chrastí šterk pod koly manželova automobilu. Nezpanikařila a rychle vymyslela řešení - postavila chlapa do kouta, řekla mu, aby se ani nehnul, namazala ho detským olejem a posypala alabastrovým práškem.Když se manžel podivoval, co to je, povída mu:\r\n"Drahý, to je socha. Stejnou si koupili Sterbovi naproti přes ulici a me se tak líbila, že jsem si řekla, že si ji koupíme taky."\r\nTím debata skončila a o soše už nepadlo ani slovo, ani když šli večer\r\nspát. Ale chvilku po tom, co manželka usnula, se chlápek zvednul, odešel do kuchyne a vrátil se se sedvičem a sklenici mléka. Otočil se k soše a říka:\r\n"Tu máte, vemte si. Ja tuhle stál u Sterbu tri dny v pozoru jako idiot a nedali mi ani sklenici vody."', 829, 3.27, 55),
	(12559, 'Po tom, čo si otec pozrel vysvedčenie svojho syna, rozčúlený klopkajúc rukou o dosku stola kričí:\r\n- Synu! Ty si sprostý ako toto drevo!\r\nA na to sa ozve syn:\r\n- Tato, niekto klope!', 190, 3.09, 55),
	(12560, 'Sedí Jožko na záchode a zrazu si všimne, že pred ním na dverách je napísané: \r\n"Pozri sa doľava!"\r\nJožko sa pozrie doľava a tam je napísané: \r\n"Pozri sa doprava!" \r\nPozrie sa teda doprava a tam je zas napísané:\r\n"Pozri sa dozadu!"\r\nOtočí sa dozadu a číta: \r\n"Neobzeraj sa a ser!"', 299, 3.11, 55),
	(12561, '- Pochovali Jozefa.\r\n- Čo mu preboha bolo?\r\n- Bol mŕtvy.', 58, 3.15, 55),
	(12562, 'Ako sa povie jogurt po bratislavsky?\r\nDano-né.', 47, 2.94, 55),
	(12563, '- Slečna, vy máte ale nádherné prsia. Sú pravé? \r\n- Nie, jedno je ľavé.', 79, 2.52, 55),
	(12564, 'Vo vlaku:\r\n"Pani, povedzte svojmu synovi, nech ma nenapodobňuje!"\r\n"Maroško, prestaň zo seba robiť debila!"', 111, 3.4, 55),
	(12565, 'Rozprávajú sa dvaja kamaráti:\r\n"Zomrela mi žena."\r\n"A na čo zomrela?"\r\n"Neviem a neviem ani načo žila."', 110, 2.91, 55),
	(12566, '- Drahá, keby som zbankrotoval, ľúbila by si ma aj potom?\r\n- Áno, ale chýbal by si mi.', 91, 3.04, 55),
	(12567, 'Príde chlap do obchodu a pýta sa predavačky:\r\n"Do you speak English?"\r\n"Yes."\r\n"Wrigley spearmint."', 102, 2.99, 55),
	(12568, 'Telefonát do rádia:\r\n- Som predseda predstavenstva BMG INVEST a chcel by som dať zahrať všetkým našim klientom pieseň "Nas nedogoňat". Ďakujem veľmi pekne.', 166, 3.47, 55),
	(12569, 'Zo zápisníka miliardára: Ak bude chcieť manželka nabudúce Čínu, myslí tým jedlo!', 90, 4.11, 55),
	(12570, 'Mrazivé ráno na Volge.Ruský bohatier Ivan Ivanovič sa vyvaľuje v člne, relax, cigáro. Jeho žena Marfusa, celá spotená, vesluje jak najatá. Oproti nim ide taký istý čln a v ňom Saša Sergejevič:\r\n"Kamze tak zrána Ivan Ivanovič ?"\r\n"Aaale, tu Marfusa ide rodiť, tak ju veziem do nemocnice."', 307, 3.33, 55),
	(12571, 'Dvaja Američania si najmú lietadlo s pilotom a odletia do Kanady loviť losov. Podarí sa im zastreliť šiestich. Keď si však chcú úlovok naložiť do lietadla, pilot im hovorí: \r\n- Do lietadla sa zmiestia iba štyri losy, so šiestimi nevzlietneme.\r\nNato sa Američania začnú vykrúcať, že oni veru aj minulý rok ulovili šiestich losov, mali prenajaté to isté lietadlo a predsa so všetkými šiestimi odleteli. Nakoniec sa pilot nechá prehovoriť a vzlietnu. Lietadlo je však preťažené a po chvílke letu sa zrúti dole. Američania vylezú z ruín a jeden sa pýta: \r\n- Ty počuj, mne je akosi toto miesto známe...\r\n- Myslím, že sem sme spadli aj minulý rok.', 686, 3, 55),
	(12572, 'Je to žlté a plazí sa to.Čo je to???\r\nVietnamec hľadá mínu.\r\nJe to žlté a letí to, čo je to???\r\nUž ju našiel. \r\nA zasa je to žlté a plazí sa to, čo je to???\r\nNedal si pokoj.', 190, 3.09, 55),
	(12573, 'Na lúke pasie bača kravy a vtom idú okolo turisti. Pýtajú sa ho:\r\n"Dedko, no a tie kravičky sa pasú?"\r\n"Nuž tie biele sa pasú."\r\n"A tie hnedie tamto?"\r\n"Aj,aj tie."\r\n"Nuž a mliečka dávajú?""\r\n"Tie biele  dávajú."\r\n"A a tie hnedie tam?"\r\n"Aj, aj tie."\r\n"No a dedo, čo spomínajú stále len tie biele kravy?"\r\n"Nuž čo, lebo tie biele tie sa moje."\r\n"No a tie hnedie tuto dole?"\r\n"Nuž aj tie."', 410, 3.7, 55),
	(12574, 'Príde ženská na gynekológiu,ľahne si na ten stolík kde sa rodí /koza/ a čaká. Za chvíľu príde chlapík a začne sa jej kukať medzi nohy.\r\nČumí,čumí,nič nevraví,usmieva sa a potom odíde. Ženská nervózna za ním kričí:\r\n"No prosím vás a ja čo tu teraz?"\r\n"Čo ja viem,my tu maľujeme."', 311, 3.32, 55),
	(12575, 'Babka v električke podáva feťákovi lístok: \r\n- Mladý pánko, nože mi to predierkujte.\r\nFeťák sa otočí ku strojčeku a po ceste vidí vojaka: \r\n- Hej vojačik, predierkuj starkej lístok!\r\n- Ja nie som vojak, ja som námorník!\r\nFeťák na druhú stranu: \r\n- Babka, zle je! Sme na lodi!', 296, 2.79, 55),
	(12576, 'Pýta sa hosť hlavného čašníka:\r\n- Prečo sa vaša reštaurácia nazýva Prekvapené oči? To máte také výborne menu?\r\nČašník odpovedá:\r\n- To nie. Zistíte potom, keď vám prinesiem účet.', 202, 2.9, 55),
	(12577, '- Aké víno piješ?\r\n- Biele suché.\r\n- Tak nasyp aj mne.', 58, 2.63, 55),
	(12578, '- Hej kámo! Čo tá hrča na čele?\r\n- Ale nič. Frajerka mi dala košom.', 74, 2.69, 55),
	(12579, 'Holič sa pýta zákazníka:\r\n- Vy ste už u nás niekedy boli?\r\n- Nie, tie jazvy mám z povstania.', 99, 3.19, 55),
	(12580, 'Som horolezec. Toto bude moja prvá expedícia do výšky, kde je ľad a sneh. Pýtam sa, čo si mám zo sebou vziať. Mačky predsa. A koľko? Dve! Vo výške 7500m mi obe zamrzli. Ďalej som išiel sám.', 205, 2.8, 55),
	(12581, 'Patológ:" Čo mi to sem vozíte, už šiesty sa bránil pitve!"', 64, 3.15, 55),
	(12582, 'Rozprávajú sa dvaja patológovia na silvestrovskom večierku:\r\n"Tak čo, otvoríme toho Huberta?"', 99, 3.26, 55),
	(12583, 'Pán Doktor, mňa všetci ignoruju.\r\nĎalší prosím.', 54, 2.95, 55),
	(12584, 'Príde ateista do kostola kde práve prebieha omša.Nerozumie ničomu  čo sa tam deje, ale napokon sa mu zapáči podávanie rúk. Tak sa rozhodol, že príde i nabudúce. Na ďalšej omši príde zase k podávaniu rúk a on vytiahne fľašu, štamperlíky a naleje okolo stojacim. Počuť cinkanie pohárov, načo sa na spovedelnici otvoria dvere a farár sa pýta:\r\n"Čo je, čo je, čo sa tu deje?" \r\n"Ty keď sa tam vykakáš aj tebe nalejem."', 448, 3.02, 55),
	(12585, 'Muž pristihne svoju ženu s poštárom, ktorý má stiahnuté nohavice. Poštár sa snaží uhrať to do autu a hovorí: \r\n- Pani! Buď mi to inkaso zaplatíte, alebo vám očúram koberec.', 190, 3.29, 55),
	(12586, 'Dvaja chlapi ležia na pláži a obdivujú baby.Zapáči sa im dievča na vodných lyžiach,ktoré sa zrazu začne topiť. Vytiahnu ju z vody a jeden z nich jej dáva umelé dýchanie a hovorí:\r\n"Fuj!Tej smrdí z huby akokeby si ju týždeň neumývala." \r\n"Nechcem ti nič hovoriť,ale dievča ,ktoré sme obdivovali malo oblečené plavky.A táto tu má na sebe zimnú bundu a korčule."', 390, 3.2, 55),
	(12587, 'V meste sa prevrátila električka, ľudia ležia pod ňou, krvácajú. Okolo ide pán a pýta sa jedného zraneného:\r\n- Prosim vás, už tu boli z poisťovne?\r\n- Nie.\r\n- Tak mi dovolte, aby som si ľahol pri vás.', 215, 3.39, 55),
	(12588, 'Maturita SJ:\r\nTéma: Vojna a mier.\r\nMáme 2 možnosti, buď je vojna, alebo mier.Keď je mier to je dobré, keď je vojna máme 2 možnosti:Buď prežijeme, alebo padneme. Keď prežijeme, to je dobré, ale keď padneme máme 2 možnosti:Buď padneme na poli, alebo v lese. Keď na poli to je dobré, ale keď v lese máme 2 možnosti:Buď z nás bude ihličnatý, alebo listnatý. Keď ihličnatý to je dobré, ale keď listnatý máme 2 možnosti:Buď z nás bude kancelarský, alebo toaletný papier. Keď kancelarský to je dobré, ale keď toaletný máme 2 možnosti:Buď sa dostaneme do ženského, alebo do mužského záchodu. Keď do ženského máme tam 2 možnosti, ale keď do mužského máme len 1 možnosť .', 725, 3.27, 55),
	(12589, 'Loď sa potápa. Kapitán príde k cestujúcim: \r\n- Kto z vás sa vie modliť? \r\n- Ja! - hrdo sa hlási jeden z cestujúcich. \r\n- To je dobre, pretože nám chýba jedno záchranné koleso.', 189, 2.81, 55),
	(12590, 'Zákazníčka sa pýta v lekárni: \r\n- Myslíte si, že ten krém na vyhladzovanie vrások je účinný? \r\n- Isteže je. My sme s ním na chalupe vyrovnávali vlnitý plech.', 173, 3.19, 55),
	(12591, 'V divadle sedí muž tak, že má nohy na rade pred ním a ruky má roztiahnuté naširoko vedľa seba. Keď to uvidela organizátorka, hneď sa na neho osopila:\r\n- Čo to má znamenať? Ako to sedíte? Veď ste v divadle! Odkiaľ ste prišli?\r\nMuž tichým, chrapľavým hlasom hovorí:\r\n- Chrrr ... z ... balkóna.', 316, 3.17, 55),
	(12592, 'Japonec sa motá okolo salaša, ide bača a pýta sa ho:\r\n- Počúvaj, kto si a čo sa tu moceš?\r\n- Ja som Ki Tsu Tchan - hovorí Japonec.\r\n- Ty si jebo a nie kysučan! Ja kysučanov veľmo dobre poznám!', 205, 3.15, 55),
	(12593, 'Viete ako sa v Čechách delia ženy?\r\nNa dá mi a nedá mi. \r\nA viete ako muži? \r\nNa múže a nemúže.', 105, 3.21, 55),
	(12594, 'Viete, prečo si bezdomovci kupujú mobilné telefóny?\r\nLebo si nemajú kde dať zaviesť pevnú linku.', 104, 2.76, 55),
	(12595, 'Na štadiońe:\r\n- 20000 ľudí, 22 hráčov, 3 rozhodcovia, 2 tréneri a ten vták sa musel vysrať rovno na mňa!', 114, 3.1, 55),
	(12596, 'Aké je životné motto anorexika?\r\nNikdy nejesť na lačno.', 60, 2.68, 55),
	(12597, 'Čo to znamená, ak pri havárii zomrie 2000 ľudí?\r\nŽe pri Lafranconi sa zrazili dve 39-viatky.', 98, 3.27, 55),
	(12598, 'Istý pán prvý raz cestuje lietadlom. Sedí pri okne a celý natešený hovorí svojmu susedovi:\r\n- Bože, z tohto lietadla tí ľudia tam dole vyzerajú ako mravce.\r\n- To sú mravce. Ešte sme nevzlietli.', 207, 2.83, 55),
	(12599, 'Slovenský štátny úradník, aby sa tváril, že niečo robí, utiera prach na lampe na stole. Zrazu, bum-bác, zjaví sa veľký džin a hovorí mu, že mu splní tri želania. Úradník je šokovaný, avšak neváha:\r\n- Chcel by som veľké studené pivo.\r\nBum-bác splní sa a na stole je perlivý mok. Teraz sa už viac zamyslí a povie:\r\n- Chcel by som byť bohatý na tropickom ostrove a okolo mňa desať sexibômb.\r\nBum-bác, splní sa, okolo neho krásky hore bez tancujú hulá-hop a preto on neváha a do tretice povie:\r\n- Tak, a teraz si želám, aby som už vôbec nemusel pracovať.\r\nBum-bác a slovenský úradník sa opäť ocitne vo svojej kancelárii.', 671, 3.29, 55),
	(12600, 'Traja koktaví uzavrú stávku:\r\nAk sa niektorému z nich podarí pýtať si v bare cigarety bez zakoktania, celý večer mu budú ďalší dvaja platiť.\r\nIdú do baru, pýta si prvý:\r\n- Ma-ma-ma-ma-marsky. \r\nKeďže sa nepodarilo, ide druhý.\r\n- Pe-pe-pe-petry.\r\nZasa nič, ide tretí.\r\n- LM! - víťazoslávne sa usmieva.\r\nBarmanka sa  ho pýta:\r\n- Dlhé alebo krátke?\r\n- Ty-ty-ty-ty krava!', 395, 3.71, 55),
	(12601, 'Na vlakovej stanici. Sedím na záchode. Tlačím, tlačím a nič. Zápcha. Zrazu vedľa mňa do kabínky niekto vbehne a počujem: pŕŕŕŕŕŕd ... žblnk ... čľup.\r\nJa:\r\n- Ako vám závidim.\r\nOn:\r\n- Nemate čo. To prvé bolo do gatí a to druhé bol mobil.', 263, 3.42, 55),
	(12602, '- Trčí ti z nosa holub!\r\n- Ale prosím ťa, kde by sa tam zmestil!', 68, 2.9, 55),
	(12603, 'Malý boh v nebi húli trávu.Nájde ho veľký boh a povie mu,že ak ho ešte raz nachýta húliť trávu pošle ho na zem.Veľký boh odíde a malý boh hneď odpáli jointa.Zase ho nachytá veľký boh a pošle ho na Zem k bačovi.Bača práve ubaľoval jointa,keď k nemu vkročil malý boh.Bača ho zavolal pohúliť.Ako tak húlia, bača sa spýta:\r\n"Ako sa vlastne voláš?".\r\n"Vieš bača,ja som malý boh."\r\n"Vravel som ti,že je to pecka."', 449, 2.95, 55),
	(12604, 'Jeden doktor na stáži navštívil miesto nazývané honosne mentálny inštitút a pýta sa jedného pacienta:\r\n"Ako ste sa sem dostal? Aká je povaha vašej choroby?"\r\n"No, začalo to tým, že som sa oženil. To som nikdy nemal robiť.\r\nVzal som si totiž jednu vdovu, čo mala dospelú dcéru, ktorá sa teda stala mojou nevlastnou dcérou.Keď prišiel na návštevu môj otec, tak sa do nej zamiloval a potom sa s ňou oženil, takže moja nevlastná dcéra teraz bola mojou nevlastnou matkou.Potom sa mojej žene narodil syn, ktorý bol samozrejme tiež otcov švagor, pretože to bol brat jeho manželky.No, ako som vám hovoril, moja nevlastná dcéra bola tiež moja nevlastná matka, takže jej malý brat bol teraz i mojím strýkom.No, a z toho tiež vyplýva, že moja žena, ktorá je matkou mojej nevlastnej\r\nmatky, je tiež mojou babičkou a ja som jej vnuk.Ale to nie je všetko. \r\nPretože mám za ženu nevlastnú babičku, nie som len jej manžel a vnuk, ale som tiež svoj dedko.Teraz už chápete, prečo som tu?"', 1037, 3.53, 55),
	(12605, '"Modroočko zahraj Santamariu."\r\n"Ja nie som Modroočko."\r\nBum,Bum Prásk.\r\n"Santamariííjáá."', 97, 2.84, 55),
	(12606, 'Otázka: \r\nAk má nejaký muž poisteného pinďúra, ktorého si cení na 1,5 mil. Sk a viac, a tento pinďúr je plne funkčný, t.z. hýbe sa podľa potreby, je tento muž povinný podať majetkové priznanie, kedže vlastní hnuteľný majetok v hodnote 1,5 mil. Sk? \r\nJe dokonca splnená aj podmienka, že ide o hnuteľný majetok s hodnotou presahujúcou 10.000,- Sk a dobou využitia dlhšou ako 3 roky.', 410, 3.16, 55),
	(12607, 'Čo je napísané na náhrobnom kameni počítačového maniaka?\r\nGAME OVER.', 76, 3.11, 55),
	(12608, 'Mamička so synčekom na prechádzke, po cestičke prebehne svišť:\r\n- No, čo to bolo, môj maličký?\r\n- Batman!\r\n- Nie, s oteckom každý večer v televízii o tom pozeráte rozprávočky, no čo to je?\r\n- Ekonomická reforma?', 230, 2.89, 55),
	(12609, 'Rozprávajú sa dvaja:\r\n- Fero, sto miliónov spermií a ty si bol najrýchlejší?\r\n- Možno som nebol najrýchlejší, možno som od poštára.', 145, 2.67, 55),
	(12610, 'Aká je totálna drzosť?\r\nKeď zomriete, nasypú na vás dvesto kilogramov hliny a na pomník napíšu "NECH TI JE ZEM ĽAHKÁ".', 129, 2.73, 55),
	(12611, 'Ak si banke dlžný 100-tisíc korún, máš problém. \r\nAk si dlžný 100-miliónov, problém má banka.', 105, 3.06, 55),
	(12612, '- Oci, ten čaj je už úplne vyvarený! \r\n- Chlapča jedno rozmaznané. Dedko ho mal celý život, ja už ho mám dvadsať rokov a mladému pánovi sa zdá zrazu vyvarený!', 173, 3.01, 55),
	(12613, 'Pýtajú sa baču:\r\n"Bača, povedzte nejakú veselú príhodu!"\r\n"No tak to sa nám raz stratila jedna žena a išli sme ju hľadať desiati a keď sme ju našli tak sme ju všetci pomilovali."\r\n"No tak bača, povedal som veselú..."\r\n"No dobre, tak to sa nám raz stratila jedna ovca a išli sme ju hľadať desiati a keď sme ju našli tak sme ju všetci pomilovali."\r\n"Baca ale veď toto vôbec nie je veselé, tak dajte radšej nejakú smutnú."\r\n"No tak teda smutnú. Tak to som sa raz stratil ja a išli ma hľadať desiati..."', 533, 3.09, 55),
	(12614, 'Viete, čo je invázia?\r\nKeď nejaká armáda obsadí inkriminované územie skôr ako USA.', 91, 3.23, 55),
	(12615, 'Bohatý africký student studující v Čechách na univerzitě píše domu rodičum, vládcúm jedné africké země:\r\n"Mám se dobře, lidi jsou fajn, cesta do školy mi utíká, protože jsem si koupil auto. Učitelé jezdí autobusem..." \r\nZa pár týdnu obdrží od rodiču dopis s přiloženým šekem na dva miliony korun a vzkazem:\r\n"Nedělej rodině ostudu a kup si taky autobus!"', 389, 3.49, 55),
	(12616, 'Viete, aké sú to skautské slipy?\r\nVpredu majú mapu a zo zadu škrtátko.', 76, 3.12, 55),
	(12617, 'Vyjde sestrička z ambulancie a kričí:\r\n"Pán Trtkal, pán Trtkal!"\r\nNikto sa neozýva. Zachvíľu vyjde zo záchoda nejaký chlapík. \r\n"Vy ste Trtkal?"\r\n"Nie, ja som sral..."', 178, 3.73, 55),
	(12618, '- Mamička, môžem vylízať misu?\r\n- Nie Jožko, stačí keď spláchneš.', 76, 3.29, 55),
	(12619, 'Ako kváka žaba v Petržalke?\r\nAkože úúúplne kvak!', 55, 3.19, 55),
	(12620, 'Na prokuratúre: \r\n- Ako ste ju znásilnili?\r\n- Ďakujem, dobre.', 64, 3.07, 55),
	(12621, 'Pred saunou sú na vešiakoch zavesené šaty a niekoľko mobilov. Zrazu jeden z nich zazvoní. Zodvihne ho starší pán, ktorý práve vychádzal zo sauny:\r\n- Áno, to som ja miláčik.\r\nPo chvílke odpovedá:\r\n- A koľko stojí ten kožuch? 10.000 tisíc? Môžeš si ho kúpiť, samozrejme. Čo? Za 3.000 náušnice pre mamu? Pravdaže ich môžeš kúpiť! To je v poriadku!\r\nPo ukončení rozhovoru vojde s mobilom do sauny s otázkou: \r\n- Chlapi, koho je tento mobil?', 474, 3.06, 55),
	(12622, '- Počul som, že keď si bol dieťaťom, bol si veľmi pekný!\r\n- To áno.\r\n- A čo sa ti stalo?', 97, 3.04, 55),
	(12623, 'Ide detektív Oriešok púšťou a stretne žirafu a pýta sa jej:\r\n- Ty si ťava?\r\n- Nie, ja som žirafa.\r\nIde ďalej a stretne slona.\r\n- Ty si ťava?\r\n- Nie, ja som slon.\r\nIde ďalej a stretne ťavu.\r\n- Ty si ťava?\r\n- Áno, ja som ťava.\r\nA dedektív oriešok víťazoslávne hovorí:\r\n- Dnes som rozriešil ďalšiu záhadu.', 328, 2.58, 55),
	(12624, 'Syn odchádza z domu a hľadá baterku:\r\n- Kam ideš, synu?\r\n- Na rande.\r\n- Ja som v tvojom veku na rande baterku nebral.\r\n- No iste, ale pozri sa, čo si doviedol!', 164, 2.99, 55),
	(12625, 'Ide dedko okolo jedného domu a vidí malého chlapčeka naťahovať sa za zvončekom pri dverách. Príde mu ho ľúto a tak horko-ťažko príde k nemu a zazvoní. A chlapček nato:\r\n- Dobre dedko a teraz utekajme!', 216, 3.55, 55),
	(12626, '- Moja mama jazdí autom ako blesk.\r\n- Tak rýchlo?\r\n- Nie, ale každú chvíľu šľahne niekam do stromu.', 107, 3.74, 55),
	(12627, 'Na Bratislavskom WC:\r\n"Je tu niekto?"\r\n"Ty chumaj! Kto by tu jedol!"', 68, 3.09, 55),
	(12628, 'Nápis na jednom hrobe:\r\nKeby si toľko nebol pil a fajčil, mohol si tu s nami sedieť piť a fajčiť.', 104, 3.46, 55),
	(12629, '"Halóóó? Linka dôvery? Ja som úplne zúfalý, chcem sa zabiť, nič mi v živote nevyšlo, nič. Pomýlil som sa v manželstve. Pomýlil som sa v zamestnaní, pomýlil..."\r\n"Pomýlili ste si aj toto číslo. Tu je bitúnok."', 229, 3.05, 55),
	(12630, 'Chlapík letí na zájazd malými aerolíniami. Letuška sa ho pýta: \r\n- Chceli by ste večeru? \r\n- A aký máte vyber? \r\n- Áno alebo nie.', 140, 3.37, 55),
	(12631, 'Riaditeľ prijíma novú sekretárku: \r\n- Milá slečna, začneme od piki.\r\nSekretárka nechápe a vraví: \r\n- Nech sa paki.', 124, 3.15, 55),
	(12632, 'Je lepšie byť nezamestnaný a pracujúci, ako byť zamestnaný a nepracujúci.', 80, 3.63, 55),
	(12633, 'Dvaja astronauti stoja na mesiaci pred raketou a jeden hovorí druhému:\r\n"Nepozeraj sa na mňa tak sproste, ja som nezamykal !"', 128, 2.71, 55),
	(12634, 'Sedia dvaja šachisti nehybne pri stole nad rozohranou partiou.Po chvíli jeden z nich hovorí:\r\n"Si na ťahu."\r\n"A to si mi nemohol povedať už včera?"', 154, 2.26, 55),
	(12635, 'Na Starjradskej 12 býva jedna tupá rodina Adamcovcov. Jedného dňa im niekto zaklope na dvere. Otvorí krivák Peter Adamec, ale nikoho nevidí. Pozrie sa lepšie a na zemi vidí malú 10cm veľkú smrťku. "Prišla si si pre mňa?" \r\n"Nie, pre tvoju matku - lebo onedlho tu prebehne deratizácia!"', 301, 3.18, 55),
	(12636, 'Volá nadržaný priateľ priateľke :\r\n"Zuzka, príď zajtra ku mne, nikto nebude doma."\r\nNa druhý deň príde Zuzka k priateľovy a nikto nebol doma.', 152, 3.05, 55),
	(12637, 'Koľko potrebuje chalanisko na to, aby sa stal mafiánom?\r\nPresne 131,- Sk.\r\n100,- Sk na šušťáky, 30,- Sk za vyholenie hlavy a korunu na mobil.', 147, 3.04, 55),
	(12638, 'Sherlock Holmes a Dr. Watson sa vybrali stanovať.  Na mieste rozložili stan a ľahli si späť. O niekoľko hodín budí Holmes svojho verného kamaráta.\r\n- Drahý Watson, pozrite sa na oblohu a povedzte mi čo vidíte.\r\n- Vidím milióny hviezd -  odpovedá Watson.\r\n- A čo vám to hovorí?\r\nWatson rozmýšľa a potom hovorí. \r\n- Z astronomického hľadiska by som povedal, že existujú milióny galaxií a miliardy planét. Z astrologického pohľadu vidím, že saturn je v znamení leva. Čo sa času týka, môj odhad je 3:15. Teologicky videné sa ukazuje, že Boh je všemohúci a my sme malí a nepodstatní. Meteorológ by povedal, že zajtra budeme mať pekné počasie. A čo hovorí obloha vám, priateľu ? \r\nHolmes potrasie hlavou.\r\n- Watson, niekto nám ukradol stan.', 789, 3.55, 55),
	(12639, 'Vracajú sa slovenskí hokejisti z Nagana, havarujú a pozabíjajú sa.\r\nPri Nebeskej Bráne stojí svätý Peter a pýta sa:\r\n"Kto ste?". \r\n"Slovenskí hokejisti." \r\n"Vy patríte do pekla!" \r\nPo chvíľke ich svätý Peter dobehne a kričí:\r\n"Je tu medzi Vami Kolník?".\r\nKolník sa ozve a svätý Peter mu hovorí:\r\n" Ty môžeš ísť do neba, ty nie si hokejista!"', 369, 3.23, 55),
	(12640, 'Sejdou se dva kamarádi po večerním mejdanu:\r\n"Tak co, jak dopadla tvoje hádka se ženou?"\r\n"No skvěle, skončila na kolenou."\r\n"Nekecej! A co říkala?"\r\n"Vylez zpod toho gauče, ty zbabelce!"', 197, 2.99, 55),
	(12641, 'Fu, Bu a Chu emigrovali z Číny do USA.Rozhodli se, že se stanou americkými občany a změní si jména. Bu se rozhodl přejmenovat \r\nse na Buck, Chu se rozhodl pro Chuck a Fu se rozhodl, že pojede zpátky do Číny.', 220, 2.86, 55),
	(12642, 'U nás ve fabrice je pracovní morálka jako na opuštěném ostrově u Robinsona. Každý čeká, kdy přijde pátek.', 118, 3.78, 55),
	(12643, 'Ideálne ženské miery:\r\n90,60,40\r\n90-rokov\r\n60-miliónov\r\n40-stupňové teploty', 81, 2.47, 55),
	(12644, 'Nájdu po rokoch na ostrove opusteného Robinsona.\r\nMá postavené 3 domy.Pýtajú sa ho, na čo sú mu 3 domy,keď žije úplne sám.\r\nRobinson hovorí:\r\n" No, v prvom dome bývam."\r\n"A druhý dom?"\r\n"Druhý dom je klub do ktorého chodím."\r\n"O.K.," strácajú ľudia trpezlivosť," a čo tretí dom?"\r\n"No, tretí dom je klub, do ktorého nechodím."', 353, 2.73, 55),
	(12645, 'Stupňovanie slova sprostý: \r\n1. sprostý, \r\n2. sprostejší, \r\n3. najsprostejší, \r\n4. mešuge, \r\n5. vymletý, \r\n6. totálne vykradnutý, \r\n7. blondínka, \r\n8. policajt, \r\n9. gumák', 184, 2.95, 55),
	(12646, 'Po reforme dopravy po r. 1989 na malú dedinskú železničnú stanicu pribehne pani a kričí na výpravcu:\r\n- Prosím vás, kedy pôjde najbližší vlak?\r\n- Len pokojne, pani, nechajte nám tu svoju adresu a my vám napíšeme.', 230, 2.81, 55),
	(12647, 'Aký je rozdiel medzi smrťou a hnačkou?\r\nŽiadny. Keď to na teba príde, musíš ísť.', 90, 2.62, 55),
	(12648, 'Autobus sa rozbieha z kopca dole a za ním beží muž.Jeden cestujúci ho vidí, vykloní sa z okna von a kričí:\r\n"Asi nás už nedohoníte !"\r\n"Musím ja som šofér !"', 172, 3.04, 55),
	(12649, '"Ferko, ten náš baran je akýsi smutný. Nemali by sme ho zabiť?"\r\n"No, keď myslíš, že ho to rozveselí..."', 114, 3.13, 55),
	(12650, 'Pýta sa riaditeľ uchádzača o zamestnanie:\r\n- Ako sa voláte?\r\n- Mi-Mi-Milan Zaťko.\r\n- Ako?\r\n- Mi-Mi-Milan Zaťko.\r\n- Vy ste koktavý?\r\n- Nie. Koktavý bol otec a matrikár bol debil!', 187, 3.18, 55),
	(12651, 'Na lavičke v parku spí bezdomovec. Zobudí ho mladá pani a pýta sa:\r\n- Prosím vás, neviete koľko je hodín?\r\n- Neviem, nemám hodinky!\r\nO tri hodiny ho zobudí skupinka chlapcov a pýta sa:\r\n- Hej bezďák, nevieš koľko je teraz asi hodín?\r\n- Neviem!!!\r\nPrejde chvíľka a príde mladý študent a opäť sa pýta:\r\n- Prosím vás, mladý pán, neviete koľko je hodín?\r\n- Neviem nič. Už ma nebuďte toľko.\r\nBezdomovec sa naštve a na kus kartónu napíše: NEVIEM KOĽKO JE HODÍN\r\nO pol hodiny ho zobudí stará babička a povie:\r\n- Pane, pol ôsmej! ', 567, 3.98, 55),
	(12652, 'Náčelník indiánov sa pýta:\r\n- Koľko máme člnov?\r\nJeden z nich sa ozve:\r\n- Ani jeden.\r\n- A koľkokrát si to spočítal? \r\n- Asi dvakrát.  ', 147, 2.81, 55),
	(12653, '- Syn môj, dnes máš osemnásť rokov, preto si môžeš zapáliť prvú cigaretu.\r\n- Ale otec, už rok predsa nefajčím.', 124, 2.83, 55),
	(12654, 'Samota v lese. O polnoci ktosi zabúcha na dvere a opýta sa: \r\n- Potrebujete drevo? \r\nZ vnútra sa ozve hlas: \r\n- Nepotrebujem.\r\nRáno sa majiteľ samoty zobudí a dreva nikde.', 177, 2.78, 55),
	(12655, 'List od dcéry z dovolenky rodičom:\r\n"Mám sa dobre, spím pod s/S/tanom, aj Stano sa má dobre."', 98, 2.65, 55),
	(12656, 'Hosť vraví čašníkovi:\r\n- Pán hlavný, prosím vás, nedalo by sa dopiecť to kurča?\r\n- Zdá sa vám málo upečené?\r\n- Čo ja viem, len mi z taniera vyzobáva zemiaky.', 175, 2.92, 55),
	(12657, 'Letí Boeing 747 na trase Boston-New York. Zrazu mu zlyhajú motory. Pilot kričí:\r\n- Veža, tu Boeing 747. Vypadli nám motory, čo mame robiť?\r\nVolanie sa opakuje. Po chvíli sa ozve:\r\n- Tu veža. Kľud, nekričte na mňa, už si vás škrtám!', 248, 3.11, 55),
	(12658, 'Do švajčiarskej banky príde nový zákazník a chce rozprávať len s riaditeľom.\r\n- "Koľko chcete uložiť?" - pýta sa ho riaditeľ.\r\nMuž si dá ruku na ústa a potichúčky hovorí:\r\n- "Sedem miliónov!"\r\nBankár ho potľapká po pleci a povie:\r\n- "Nemusíte šepkať. U nás nie je chudoba nijakou hanbou!"', 316, 3.21, 55),
	(12659, '- Môj syn je skutočný zázrak, - chváli sa istý otec. - Má iba tri roky, ale už vie čítať, hrať na klavíri a kresliť.\r\n- Môj je ešte lepší, - vraví druhý otec. - Má iba tri týždne, ale už vie, že život je drahý, že platy sú malé, že dane sú vysoké, že bývať nie je kde, že si ničíme životné prostredie...\r\n- Odkiaľ viete, že vie všetko toto?\r\n- Nuž, jednostaj plače.', 411, 3.12, 55),
	(12660, 'Matka hreší dcéru, ktorá žobrákovi pod Michalskou bránou hodila do klobúka 50 korún. \r\nDcéra jej hovorí:\r\n- Ale, mami, veď to bol náš triedny.', 156, 3.07, 55),
	(12661, 'Otec, syn a vnuk sa vyberú do bordelu. Všetko dobre dopadne a keď sa na druhý deň stretnú, rozprávajú si svoje zážitky. Otec hovorí:\r\n- Tá vášeň, tá vášeň, to je niečo.\r\nSyn:\r\n- Čo vášeň, ale tá technika. \r\nA dedko:\r\n- A tá trpezlivosť.', 263, 3.26, 55),
	(12662, '- Fero, prečo v tej tvojej mušli nepočuť šum mora?\r\n- Pretože to je mušľa z Mŕtveho mora.', 98, 2.86, 55),
	(12663, 'Do vlaku tajne nastúpi "čierny pasažier", zrazu zbadá ako tam kontroluje revízor. V strachu nevie, čo má robiť, preto sa v rýchlosti schová na WC. Revízor ho ale zbadá, preto ho hneď prenasleduje, klope na dvere:\r\n- Je tu niekto? - opýta sa\r\nZ WC sa ozve:\r\n- Ty blbec, kto by tu asi jedol?', 303, 2.91, 55),
	(12664, 'Arab prezlečený za tehotnú ženu nastupuje do lietadla a letuška sa ho pýta:\r\n- Čo to bude, chlapček alebo dievčatko?\r\n- Dvojičky.', 139, 3.53, 55),
	(12665, '- Lukáško, čím budeš po absolvovaní vysokej školy?\r\n- Nezamestnaným!', 76, 2.91, 55),
	(12666, 'Letuška v letiacom lietadle sa pýta:\r\n- Nie je medzi cestujúcimi nejaký lekár?\r\nJeden z cestujúcich vstane a ide do pilotnej kabíny. Za chvíľu vyjde von a pýta sa:\r\n- Nie je medzi cestujúcimi nejaký pilot?', 217, 2.87, 55),
	(12667, 'Po roku od promócie sa stretli dvaja bývali spolužiaci:\r\n- Človeče, keď pomyslím na to, aký som ja inžinier, tak sa normálne bojím ísť k lekárovi!', 160, 3.43, 55),
	(12668, 'Vbehne chlap na záchod a začne búchať na dvere kabínky:\r\n- Pustite ma dnu, mám hnačku a poser.. sa!\r\nZ kabínky sa ticho a ťažko ozve:\r\n- To vám závidím.', 165, 3.08, 55),
	(12669, 'Stoja dvaja kozmonauti pred raketou.\r\n- Čo na mňa tak blbo hľadíš, ja som nezamykal!', 89, 2.97, 55),
	(12670, '"Obžalovaný, na všetky otázky odpovedajte ústne."\r\n"Akú školu ste navštevovali?"\r\n"Ústne..."', 101, 2.79, 55),
	(12671, 'Na firemnom večierku vraví kolega kolegom vtip: \r\n- Hovorí sa pipich alebo pipiš?\r\n- Pipiš.\r\n- Tak si zadok vylíž!\r\nJednému zamestnancovi sa to zapáčilo a tak to pri najbližšej situácii použije:\r\n- Hovorí sa pipich alebo pipiš?\r\n- No predsa pipiš.\r\n- Tak si vylíž zadok!', 289, 2.52, 55),
	(12672, 'Aký je rozdiel medzi ženou a kávou?\r\nŽiaden. Najprv ťa vzruší a potom znervózňuje.', 91, 3.06, 55),
	(12673, 'Dvaja drevorubači sa vybrali vypíliť najväčší smrek v lese. Zobrali si iba ručnú pílu bruchatku. Po polhodine pílenia, keď už pre kmeň na seba nevidia jeden hovorí: \r\n- Jano, tá píla ide voláko ťažšie.\r\n- Ja neviem, ja fajčím.', 249, 3.06, 55),
	(12674, 'Na súde.\r\n- Prečo ste zabili svoju svokru?\r\n- Viete, to mi vlastne povedala mnželka.  Povedala: \'Tam leží moja mamička. Keď na ňu sadne mucha, zabi ju!\'', 160, 3.02, 55),
	(12675, '- Prečo sa ten guláš volá turecký?\r\n- Lebo ten pes sa volal Sultán.', 73, 2.86, 55),
	(12676, '- Pane, prosím vás, mohli by ste nám...\r\n- Vy mne tiež!', 59, 2.93, 55),
	(12677, 'Pán Novák príde do roboty a hovorí:\r\n- Viem, že meškám stále, ale dnes mám na to dôvod.\r\n- A to už aký?\r\n- Budem mať dieťa!\r\n- A čo to bude?\r\n- Neviem, to sa dozviem o deväť mesiacov.', 200, 3.04, 55),
	(12678, 'Na břehu ostrova stojí zarostlý muž a mává rukama na loď plující okolo něho. \r\n- Kdo je to? - ptá se jeden pasažér kapitána.\r\n- Nevím, ale vždycky se tahle raduje, když jedeme okolo.', 199, 3.18, 55),
	(12679, 'Dcera přinesla ze školy domu poznámku: \r\n- Je hubatá, drzá a nedá si říct.\r\nDruhý den učitelka čte v žákovské knížce: \r\n- To má po matce, zmlátil jsem obe. Otec!', 179, 2.89, 55),
	(12680, 'Černoch s papouškem na rameni vejde do obchodu a prodavačka praví: \r\n- Je krásný, odkud ho máte?\r\n- Z Afriky, tam je jich plno. - odpoví papoušek.', 155, 3.66, 55),
	(12681, 'Je krásné ráno. Chlapeček se probouzí a vidí ve svém pokoji modrého králíka. \r\n- Kdo jsi?\r\n- Já jsem Azurit.\r\n- A co tu děláš?\r\n- Kradu ti rifle.\r\n- A budeš tady, až se vrátím?\r\n- No ty si asi vadnej, ne?', 222, 3.03, 55),
	(12682, 'Štyri najtenšie knihy sveta:\r\n- Poľská kuchárka\r\n- Cigánsky zákonník práce\r\n- Letecký poriadok Červeného námestia\r\n- Telefónny zoznam Černobyľu', 159, 3.09, 55),
	(12683, 'Hlásenie v mestskom rozhlase:\r\n- Pozor! Pozor! Na miestnom kúpalisku sa stratili dva kľúče! Jeden takýto, druhý dózický!', 129, 2.7, 55),
	(12684, '- Ocko, čo je toto za ovocie?\r\n- To sú čierne ríbezle.\r\n- A prečo sú červené?\r\n- No, lebo sú ešte zelené.', 116, 4.27, 55),
	(12685, 'Vojak, žena a kňaz sedia vo vlaku a lúštia takú istú krížovku. Žena sa pýta:\r\n- Časť tela na 4, začína na P a končí na A.\r\nVojak:\r\n- Päta.\r\nA kňaz:\r\n- Nemá niekto gumu?', 187, 3.38, 55),
	(12686, 'Celý svet je naruby - najlepší rapper je beloch, najlepší golfista je černoch a Nemecku sa nechce do vojny.', 113, 3.52, 55),
	(12687, '- Jej slečna, vy máte pekného psa! Môžem si vás pohladkať?', 65, 3.02, 55),
	(12688, 'Aké je najrozšírenejšie ovocie na Slovensku?\r\nFiga borová!', 63, 2.68, 55),
	(12689, 'Vážení cestujúci, hovorí k vám kapitán lietadla. Keď sa pozriete na ľavé krídlo, zistíte, že horí. Pohľadom na pravé krídlo zistíte to isté. Keď sa pozriete dole, uvidíte široký modrý oceán. Kto z vás vidí lepšie, zbadá malú žltú bodku. Tá bodka, to je nafukovací záchranny čln. A v ňom práve teraz sedím.', 344, 3.3, 55),
	(12690, 'Stretlo ma šťastie - prišlo sa rozlúčiť.', 46, 3.33, 55),
	(12691, 'Syn stretne otca pri nevestinci a pýta sa:\r\n- Oci, čo tu robíš?\r\n- Ale synak, nebudem predsa pre pár stoviek budiť mamu.', 126, 3.11, 55),
	(12692, 'Výpis z SMS: Budem u teba o 10.00 hod, v tebe o 10.01 hod.', 59, 3.44, 55),
	(12693, 'Riaditeľ hovorí sekretárke: \r\n- Marienka, musíme si vážne pohovoriť o vašom plate. \r\nSekretárka mu odpovie: \r\n- Ale pán riaditeľ, už sa nedám oklamať, na tuto tému sme sa už milovali tri krát.', 209, 3.55, 55),
	(12694, 'Zazvoní telefón a ozve sa z neho:\r\n- Máš CLIP?\r\n- Áno, mám.\r\n- To ti nepomôže, ty sviňa, lebo ja mám CLIR.', 116, 2.61, 55),
	(12695, 'Kto je najväčší socialista?\r\nPodprsenka. Veľké utláča a malé pozdvihuje...', 83, 3.35, 55),
	(12696, 'Čašník hosťovi:\r\n"Pane, ak vám jedlo nechutí, nehrabte sa v ňom! Kto to má po vás jesť?"', 98, 3.03, 55),
	(12697, '\'Chcem zomrieť pokojne, v spánku, ako môj strýko. Nie ako tí ustrašení vrieskajúci ľudia, ktorých viezol!\'', 116, 3.27, 55),
	(12698, 'Cestujúci, čo práve vystúpil z narvanej električky, sa na zastávke pýta:\r\n"Prosím vás, ďaleko je to na Sládkovičovu ulicu?"\r\n"To ste mali ešte zostať v električke a vystúpiť až o 4 zastávky ďalej!"\r\n"Zaujímavé, a v električke mi povedali, že už mám vystúpiť."\r\n"A v tej električke ste sedeli alebo stáli?"', 335, 3.1, 55),
	(12699, 'Cestujúci v taxíku chce osloviť šoféra, tak ho poklepe po pleci, aby mu venoval pozornosť. Šofér sa na smrť vyľaká a okamžite šliapne na brzdy. Cestujúci na to:\r\n- Čo je? Len som sa chcel niečo opýtať...\r\nVydesený vodič skríkne:\r\n- Sorry, ale bežne jazdním s pohrebákom!', 294, 3.33, 55),
	(12700, 'Študent sa sťažoval na zlé ubytovanie:\r\n"A čo je na tom vašom bývaní také strašné?"\r\n"Napríklad myši."\r\n"To nie je možné!"\r\n"Tak sa poďte pozrieť."\r\nVošli do izby, študent zobral kúsok chleba a začal na zem sypať odrobinky. Po chvíli sa objavila myška, za ňou druhá, tretia... potom sa objavila rybka, a po nej zase myši.\r\n"No, fakt sa nejako premnožili. Ale čo tá rybička?"\r\n"Tak už mi veríte, že tu máme myši? Takže sa môžeme začat baviť o vlhkosti."', 493, 3.24, 55),
	(12701, 'Indián je človek ako ty, len on má pero na hlave.', 52, 2.79, 55),
	(12702, '"Koľko máte detí?"\r\nSpýtal sa úradník mladej ženy.\r\n"Sedem."\r\n"A koľko majú rokov?"\r\n"Dvanásť, jedenásť, desať, deväť, osem, sedem a šesť. Potom sme si kúpili televízor."', 190, 2.94, 55),
	(12703, 'Letuška upozorňovala cestujúcich, že pred pristaním sa májú pripútať, keď si všimla, že jeden je mimoriadne vystrašený. Pýtala sa ho, čoho sa bojí.\r\n"Viete, ja som sa ešte nikdy k zemi neblížil takýmto strašným spôsobom. Som totiž parašutista."', 270, 2.7, 55),
	(12704, 'Mladý muž v električke:\r\n"Pani, sem si sadnite!"\r\n"Seď, chlapče. Ja postojím."\r\n"Len si sadnite! Aby ste si nemysleli, že uvoľňujem miesto len pekným a mladým ženám."', 179, 3.16, 55),
	(12705, 'Oznam prilepený na dverách WC:\r\n"Po veľkej potrebe použite kefu."\r\nPod oznamom dopísané rukou:\r\n"Kefu som použil, toaletný papier je lepší."', 150, 3.85, 55),
	(12706, '- Vieš aký je rozdiel medzi nevedomosťou a nezáujmom?\r\n- Neviem a nezaujíma ma to!', 87, 3.13, 55),
	(12707, 'Pýta sa "návštevník" v záchytke:\r\n- Rád by som vedel, prečo ste ma sem doviedli?\r\n- Kvôli pitiu.\r\n- Tak to je iná vec, kedy začíname?', 144, 3.36, 55),
	(12708, 'Príde občan na úrad práce a hovorí:\r\n"Chcel by som prácu, ktorá dobre vynáša."\r\n"Výborne. Máme pre vás miesto riaditeľa so šesdesiattisícovým mesačným platom a služobné auto k tomu."\r\n"Robíte si zo mňa srandu?"\r\n"Vy ste s tým začali."', 258, 3.54, 55),
	(12709, 'Príde chlap do zoologickeho obchodu:\r\n"Prosím si dvetisíc švábov."\r\n"Bohužial, nemáme. A na čo ich, preboha, potrebujete?"\r\n"Viete, mal som prenajatý byt a teraz ho idem vrátiť. V nájomnej zmluve je napísané, že ho mám vrátiť v tom stave, v akom som ho prevzal."', 280, 3.01, 55),
	(12710, 'Stretnú sa dvaja potápači:\r\n- Včera som sa potápal v 1500m hĺbke a stretol som americkú ponorku.\r\n- A ako vieš, že to bola americká ponorka?\r\n- Prišiel som bližšie, zaklopal na okno a oni začali mávať americkými vlajkami.\r\n- Hm,to nie je nič. Ja som sa včera potápal v 2000m hĺbke a stretol som policajnú ponorku.\r\n- A ako vieš, že to bola policajná ponorka?\r\n- Prišiel som bližšie, zaklopal na okno a oni otvorili.', 443, 3.75, 55),
	(12711, 'Akýsi chlapík sa pýta okoloidúceho milionára:\r\n- Videli ste tu niekde policajta?\r\n- Nie.\r\n- Tak ruky hore a navaľ prachy!', 127, 3.04, 55),
	(12712, 'Ide pán po ulici a zrazu sa mu na plece vyšpiní drozd.\r\nSmutne sa pozrie hore a povzdychne si:\r\n- A druhým spievaš!', 120, 3.16, 55),
	(12713, 'Hadají se dva důchodci komu se víc klepou ruce. Jeden povídá.\r\n- Já když jdu po schodech tak jak se mi klepou ruce tak,že mi vždycky spadnou berle o schod níž a já si rozbiju držku.\r\nDruhý se zvedne a povídá.\r\n- To nic neni, já když jsem byl minule curat na záchode tak jsem se třikrát udelal.', 314, 3.28, 55),
	(12714, 'Ako sa začína každý recept v kuchárskej knihe v Somálsku?\r\nOtvoríme balíček humanitárnej pomoci.', 106, 3.06, 55),
	(12715, 'Skoro plešatý pán příjde k holiči a chce nějaký moderní účes. Ten se na něj chvíli dívá a povídá: \r\n- Doporučoval bych účes \'na Ferdu Mravence\'. \r\n- No a to je jak?\r\n- Noo, jeden vlas vám ustřihnem, zbývající dva natužím a můžete to mít jako tykadla!', 280, 3.08, 55),
	(12716, 'Potkají se dva kamarádi a jeden druhému povída:\r\n- No nazdar, tebe už jsem dlouho neviděl, kde jsi byl?\r\n- Ále, byl jsem na kurzu asertivity.\r\n- Nekecej, a co ses tam naučil?\r\n- Co je ti do toho, doprdele!', 213, 3.35, 55),
	(12717, 'Na WC čúrajú vedľa seba veľký a malý chlap. Veľký chlap stále pošklbáva ramenom.\r\n- Čo Ti je?, pýta sa malý.\r\n- Ále bol som v povstaní, to sú nervy. \r\nVeľký pozrie na malého a ten stále žmurká.\r\n- Čo aj Ty si bol v povstaní?\r\n- Ja nie, ale čúraš vysoko a strieka mi to do tváre.', 308, 3.48, 55),
	(12718, 'U hodinára:\r\n- Opravili ste mi ich?\r\n- Jasnačka.\r\n- A idú dobre?\r\n- Jasnačka, že dobre. A dal som tam aj malý trik. Keď odbíja desať a ukazuje štvrť na dvanásť je presne trištvrte na tri.', 201, 3.43, 55),
	(12719, 'Pán v reštaurácii nesmelo na vrchného: \r\n"Pan vrchný, eehmmm.., vy ste na mňa zabudli?"\r\n"Nie, nezabudol. Ja som sa na vás vykašlal."', 141, 3.19, 55),
	(12720, 'Sretnú sa dvaja koktaví v obchode a jeden hovorí druhému:\r\n"Sta.. sta.. stav sa, že.. že.. že si vypýtam o.. o.. od predavačky ci.. ci.. cigarety a ne.. ne... nezakoktám sa!"\r\nTak sa stavia, ten prvý príde za predavačkou a hovorí:\r\n"Prosím si jedny Marsky!"\r\nPredavačka mu ich dá, a on vyhrá stávku. Tomu druhému to nedá spať, a tak sa na druhý deň staví, že to dokáže aj on. Príde k predavačke a s úsilým povie bey koktania :\r\n"Prosím si jedny Petry!"\r\n"Dlhé alebo krátke?"\r\n"Ty.. ty.. ty krava!"', 532, 2.92, 55),
	(12721, 'Fero sa pohádal so ženou a preto sa s ňou nerozpráva. Kedže potreboval ráno skoro vstať, napísal žene odkaz: \r\n- Žena, zobuď ma ráno o pol šiestej!\r\nPotom šiel pokojne späť. Na druhý deň sa zobudí o desiatej a na nočnom stolíku lístok: \r\nFero vstávaj, už je pol šiestej!', 295, 3.38, 55),
	(12722, 'Prečo používajú dôchodcovia viagru?\r\nPreto, aby im nespadli slipy.', 71, 2.42, 55),
	(12723, 'Byť lenivý má svoje výhody. Jednou z nich je tá, že nemusíte vysvetlovať aké, lebo ste na to proste lenivý.', 117, 3.08, 55),
	(12724, 'Babka má odložené zuby v pohári. Vnučka vezme pohár a obzerá si ho z každej strany. Po chvíli povie: \r\n- Babka, aké ty máš krásne zuby, ani jeden kaz.', 163, 3.13, 55),
	(12725, 'Čo je to domov dôchodcov? \r\nPomsta detí za jasle. \n', 54, 3.06, 55),
	(12726, '- Pane, nesvieti vám heligón!\r\n- Snáď chcete povedať halogén, nie?\r\n- No vy ste ale nejaký suvenír!\n\r\n(používať cudzie termity so sebou prináša veľké rizoto - mohlo by sa vám to vrátiť ako buzerant)', 216, 3.26, 55),
	(12727, '"Máte bravčovú hlavu?"\r\n"Áno."\r\n"Tak Vám treba!"', 53, 3.04, 55),
	(12728, '"Slečna, máte prsia?"\r\n"Áno..."\r\n"Tak prečo ich nenosíte?"', 63, 3, 55),
	(12729, 'Chlapec vidí muža v uniforme. Podíde k nemu a pýta sa ho:\r\n"Ujo, vy ste policajt?"\r\n"Čoby,ja som železničiar. To som sa len tak hlúpo tváril!"', 151, 3.24, 55),
	(12730, 'Angličan sa ubytoval na Slovensku na izbe 222. Objednal si na recepcii telefonicky dva rumy: \r\n"Two rums to room two two two."\r\nRecepčná na to: \r\n"Tram ta rara tram ta ta" ... a zložila telefón.', 199, 3.41, 55),
	(12731, 'Stretnutie dvoch kamarátov po dlhom čase:\r\n- Prečo vyzeráš tak nešťastne?\r\n- Ale, založil som si firmu, ale dal som jej strašne dlhý názov a ten sa mi nechce zmestiť do koloniek na tlačivách...\r\n- No tak si sprav skratku!\r\n- Keď to práve nemôžem. Tá firma sa volá "Projekčná inžinierska činnosť, analýzy".', 331, 3.69, 55),
	(12732, 'Dvaja dedkovia sedia v parku na lavičke a jeden z nich sa chváli:\r\n"Viete Vy, koľko ja mám rokov?"\r\n"Nie."\r\n"98!"\r\n"No, to už ani nemusíte ísť domov!"', 158, 3.16, 55),
	(12733, 'Uplakaná pani volá na policajnú stanicu a hovorí:\r\n- Zabila som Kohúta!\r\nPolicajt odpovedá:\r\n- Ale veď to je normálne pani!\r\n- Ale ja som zabila Kohúta!\r\n- No dobre pani, napíšeme zápisnicu. Ako sa voláte?\r\n- Kohútová.', 233, 3.06, 55),
	(12734, 'Poučte dospievajúce dieťa ako sa má učiť:\r\n- Sadni si synu, dáš si panáka?\r\n- Jasné\r\n- Cigaretku?\r\n- Jasné\r\n- Pozrieme Playboy?\r\n- Môzeme\r\n- Čo hovoríš na tieto baby?\r\n- Dobré\r\n- A vieš, kto s nimi spáva?\r\n- No kto?\r\n- Iba jednotkári, synu, iba jednotkári.', 276, 3.59, 55),
	(12735, 'Mladší brat sa chváli staršiemu:\r\n- Fero, dnes som našiel 50 eúr!\r\n- A čo si s nimi spravil?\r\n- Stratil som ich.', 119, 3.15, 55),
	(12736, 'Nahnevaný sused kričí cez plot na Deža: \r\n- Dežo, tvoje štyri deti mi kradnú v záhrade jablká! \r\n- Nehovor. A piate sa kde túla?', 138, 3.18, 55),
	(12737, 'Dospievajúca dcéra sa prizná matke, že už nie je panna. Matka zalomí rukami a lamentuje:\r\n- Preboha! Tvoja sestra je staršia než ty a ešte je poctivá!\r\nDcéra sa ohradzuje:\r\n- Mami, je to tvoja vina. Odmalička som musela ísť prvá do postele.', 255, 2.77, 55),
	(12738, 'Kedy požiadaš blondínku o ruku?\r\nKeď už nevládze ústami.', 63, 3.98, 55),
	(12739, 'Rozzúrený chlapík telefonuje do hydrometeorologickej stanice:\r\n- Vy buzeranti, už týždeň v kýbli vynášam to vaše polojasno!', 134, 3.79, 55),
	(12740, 'Príde cudzinec do trafiky:\r\n"Do you speak English?"\r\n"Erm, hmh, Yes."\r\n"Marlboro, please!"', 91, 3.2, 55),
	(12741, 'Čo je totálna hnačka???\r\nKeď chodíš na WC tak často, že sa stretávaš.', 79, 3.27, 55),
	(12742, '- Áno, som schizofrenik! Ale na rozdiel odo mňa si to priznávam!', 67, 3.46, 55),
	(12743, 'Príde starší pán k zubárovi a hovorí mu: \r\n- Pán doktor, ja keď idem na záchod, mne sa kývu zuby. \r\n- Vážne? Tak si sadnite, otvorte ústa a ja sa vám na to pozriem.  \r\nDoktor mu chvíľu prezerá ústa a potom hovorí: \r\n- Dedko, keď jete španielske vtáčky, nitku musíte odstrihnúť.', 303, 2.89, 55),
	(12744, 'Príde chlap do baru a hovorí:\r\n- Kto mi natrel všetky koňe v stajni na žlto?\r\nPostaví sa Svalnatý chlap:\r\n- Ja a čo!\r\nPrvý chlap sa stiahne a hovorí:\r\n- Nuž, ja len že si vybral dobrý odtieň!', 205, 3.05, 55),
	(12745, 'Pôrodná babica, ktorá odrodila stovky detí príde do neba. Svätý Peter ju už na bráne začne prehovárať:\r\n- Babička, ty si taká dobručká! Vráť sa ešte na zem a pomáhaj ženám v ich bolestiach. Nikto to nevie lepšie, ako ty.\r\n- Aj by som sa vrátila, svätý Peter, ale už sa nemôžem pozerať na to, ako ženy pri pôrode trpia a otcovia si užívajú. \r\n- To nie je problém, babi. Zariadim, aby pri každom tvojom pôrode otec trpel rovnako ako rodička!\r\nTak sa babka vrátila na zem a hneď ju aj zavolali k pôrodu. Žena rodí v bolestiach a manžel sedí pri okne, popíja pivo a rehoce sa. Babka sa ho pýta:\r\n- Vás nič neboli?\r\n- Mňa nie! - odvetí chlap - Ale pozrite von oknom na toho kominára! Zvíja sa ako keby rodil!', 757, 3.68, 55),
	(12746, 'Príde dement do cukrárne a pýta si zmrzlinu:\r\n- Prosím si jednu zmrzlinu.\r\n- A akú? Jahodovú, čokoládovú, vanilkovú, alebo akú? - hovorí predavač.\r\n- To je jedno, aj tak mi spadne na zem.', 200, 3.4, 55),
	(12747, 'Viete, ako spoznáte doktora?\r\nKeď v obchode platí dvadsiatkami.', 66, 2.93, 55),
	(12748, 'Turisti stoja pod Michalskou bránou v Bratislave, keď zrazu priletí rogalo a celou silou narazí do veže. Rogalista sa mŕtvy zosype na zem. O chvíľu sa opakuje presne to isté s druhým rogalistom. Ďalší mŕtvy. Turistom to už nedá, tak sa opýtajú žobráka pod bránou, čo to má preboha znamenať. Žobrák len pokrčí plecami: \r\n- Chudobná krajina, chudobní teroristi.', 389, 3.42, 55),
	(12749, 'Palo hovorí:\r\n- Voľakedy behali za mnou ženy ako bláznivé.\r\n- Prečo o tom hovoríš v minulom čase? - pýta sa ho kamarát.\r\n- Lebo som už prestal kradnúť kabelky.', 173, 3.59, 55),
	(12750, 'Rozhovor dvoch mafiánov:\r\n- Bol strýko nadšený, keď si mu povedal, že si jeho dcéru požiadal o ruku?\r\n- A ešte ako, zaraz mu z ruky vypadol revolver.', 158, 2.95, 55),
	(12751, 'Príde chlap k jasnovidke. Jasnovidka hovorí:\r\n- Za tri stovky vám zodpoviem tri otázky.\r\nChlap sa opýta:\r\n- Za tri stovky len tri otázky, nie je to veľa?\r\n- Nie. Aká je vaša druhá otázka?', 198, 3.04, 55),
	(12752, 'Muž v lietadle zastaví letušku a hovorí jej:\r\n- Viete, ja mám takú smolu, mne sa stále niečo prihodí.\r\n- Nemusíte sa báť, tu sa vám určite nič nestane.\r\nA odíde. O 5minút sa z reproduktorov ozve:\r\n- Lietadlo havaruje a spadne rovno do mora. Nemusíte sa báť, letušky vám dajú píšťalky na odplašenie žralokov.\r\nMuž  zastaví letušku a opäť sa sťažuje:\r\n- Vidíte, buď natrafím na hluchého žraloka alebo vyfasujem píšťalku bez dierky.', 472, 3.18, 55),
	(12753, 'Dobrý deň, dovolali ste sa na záznamník Rýchlej zdravotníckej pomoci. Po zaznení signálu nám zanechajte odkaz.', 119, 2.89, 55),
	(12754, '- Čo robíš, Emil?\r\n- Ale, otvoril som si obchod.\r\n- A prosím ťa, s čím?\r\n- No predsa šperhákom!', 104, 3.12, 55),
	(12755, 'Dvaja maliari natierajú byt - majster a učeň.\r\nMajster: \r\n- Choď do druhej izby a namaľuj tam okná.\r\nUčeň odíde a vráti sa za 30 minút:\r\n- Pán majster, už to mám, môžem aj rámy?', 194, 3.24, 55),
	(12756, 'Chlapík prišiel do krčmy:\r\n- P-p-prosím si p-p-pivo.\r\nČašník sa ho pýta:\r\n- Máte problémy s koktaním?\r\n- T-t-trošku.\r\n- Aj ja som mal, hovorí čašník, ale raz som strašne pomiloval moju ženu a odvtedy je všetko v poriadku. Skúste to aj vy.\r\nNa druhý deň prišiel chlapík zasa:\r\n- P-p-prosím si p-pivo.\r\n- No čo, nepomohlo?\r\n- N-n-nie, ale s-s-spálňu m-máte p-p-peknú.', 395, 3.59, 55),
	(12757, 'Rozprávajú sa dvaja bezdomovci o tom, aký zvyknú byť hladný:\r\n- Minule som tak dlho nič nejedol, že sa mi na zadku spravila pavučina!\r\n- To je nič! Ja som sa minule pobral za krík, že si tam uľavím a ako tak čupím strašne hladný, počujem niečo chrumkať. Obzriem sa a to sa mi riť pasie na tráve.', 318, 3.16, 55),
	(12758, 'Letí Slovák s Američanom v lietadle a Slovák hovorí:\r\n- Už sme na Slovensku.\r\n- Ako to viete?\r\n- Ukradli mi hodinky.', 122, 4.04, 55),
	(12759, 'Pýta sa pacientka chirurga pred operáciou: \r\n- Pán doktor, mám ja vôbec nejakú šancu? \r\n- Ale prosím vás. Dvadsiaty krát operujem. A raz sa to musí podariť.', 168, 3.31, 55),
	(12760, 'Príde chlap do hotela a chce izbu. Recepčný mu vraví:\r\n- Vaše meno? \r\n- Nonononovák. \r\n- Jasné, Novák. \r\n- Nie, Nonononovák. \r\n- Ja viem, vy ste koktavý. \r\n- Nie, môj otec bol koktavý a matrikár bol debil.', 218, 3.51, 55),
	(12761, 'Stretnú sa dvaja. Koktavý a krívajúci:\r\n- P-p-poznám s-s-spôsob a-b-by s-s-s-si n-n-n-ekk-r-ríval !\r\n- No to je fajn. Povedz mi ho!\r\n- M-m-m-usíš i-i-ísť j-j-eednou n-n-ohou n-na o-o-o-brubníku a d-d-druhou n-n-a z-z-emi.\r\n- A ja poznám spôsob, aby si nekoktal.\r\n- T-t-to b-b-y b-b-olo s-s-uper!\r\n- Drž hubu!', 323, 3.04, 55),
	(12762, 'Správa vo večerných televíznych novinách:\r\nDnes ráno sa v našom hlavnom meste sa stala vážna tragédia. Lietadlo s 80 cestujúcimi sa zrútilo na miestnom cintoríne. Záchranári, ktorý doteraz odstraňujú následky tejto havárie s napätím všetkých síl už vyprostili 2000 obetí tejto nešťastnej havárie.', 326, 2.96, 55),
	(12763, '- Pán sused, včera moja dcéra musela prerušiť hodinu spevu, lebo váš pes strašne zavíjal!\r\n- Áno, ale vaša dcéra začala!', 133, 2.86, 55),
	(12764, 'Zomrel mäsiar a jeho posledné slova boli: "Fero, hoď mi ten veľký nôž."', 78, 3.1, 55),
	(12765, 'Idú dve malomocné africké dievčatká do školy a vravia si:\r\n- Ktovie, čo nám dneska ODPADNE?!?', 101, 3.11, 55),
	(12766, 'Z kopca sa rozbieha autobus. Zrazu za ním začne bežať muž. Jeden cestujúci ho vidí a vraví:\r\n- Už nás nedobehnete.\r\n- Musím, ja som šofér.', 151, 3, 55),
	(12767, 'Na zastávke:\r\n- Nazdar Fero! Ako sa máš? Ešte si sa neoženil?\r\n- Nie.\r\n- A na čo čakáš?\r\n- Na autobus!', 111, 3.01, 55),
	(12768, 'Stretne tučný chudého a hovorí mu:\r\n- Keď ťa vidím, tak mám dojem, že vypukol hladomor.\r\nChudý odpovedá:\r\n- A keď ja vidím teba, myslím, že príčinou si ty!', 172, 2.6, 55),
	(12769, '- Bača, tú strechu máte strašne deravú. Nezateká vám cez ňu?\r\n- Nie, len keď prší!', 93, 2.92, 55),
	(12770, 'Dvaja chalani sedia na brehu jazierka a pozorujú dievčinu na vodných lyžiach. Zrazu dievča spadne do vody. Obaja chalani sa duchaplne vrhnú za ňou. Vytiahnu ju z vody a jeden jej dáva umelé dýchanie. Zrazu vstane, odpľuje si a hovorí: \r\n- Fuj, tej páchne z úst, ako keby si týždeň zuby neumývala.  \r\nA ten druhý mu na to:\r\n- Mne je divné to, že tá na vodných lyžiach mala na sebe plavky a táto má vetrovku a korčule.', 443, 3.35, 55),
	(12771, '- Čo si dilino? Načo polievaš tie kvety, keď v krhle nemáš vodu? \r\n- Ty si dilino! Nevidíš, že tie kvety sú umelé? ', 126, 3.83, 55),
	(12772, 'Žena si privedie milenca. Manžel je v práci, ale nečakane príde domov jej 9 ročný syn, tak ho zavrie do šatníka. O chvílku príde nečakane aj manžel a tak zavrie do šatníka aj milenca. Syn hovorí milencovi:\r\n- Je tu tma.\r\n- To hej.\r\n- Mám baseballovú loptu.\r\n- To je super.\r\n- Kúpiš?\r\n- Nie vďaka.\r\n- Ale otec je vonku.\r\n- OK, koľko?\r\n- 25$.\r\nO pár týždňov sa situácia opakuje, chlapec a milenec zasa skončia v šatníku a chlapec hovorí:\r\n- Je tu tma.\r\n- To hej.\r\n- Mám baseballovú rukavicu.\r\nMilenec si spomenul ako to bolo predtým tak sa rovno spýtal:\r\n- Koľko?\r\n- 75$.\r\n- OK.\r\nO pár dni hovorí otec synovi:\r\n- Zober rukavicu a loptu, pôjdeme si na dvor zahádzať.\r\n- Nemôžem, predal som ich za $ 100.\r\n- To je nepekné, že takto ožobračuješ svojich priateľov, pôjdeš sa do kostola vyspovedať.\r\nPrídu do kostola, otec si sadne do lavice, chlapec vojde do spovedelnice a hovorí:\r\n- Je tu tma.\r\n- Nezačínaj s tým zase.\n\n', 973, 3.62, 55),
	(12773, 'Príde manžel domov a hovorí:\r\n- Drahá, vyhral som milión. Rýchlo sa obleč!\r\n- Čo si mám obliecť?\r\n- To je jedno, len už vypadni!', 139, 3.33, 55),
	(12774, 'Ako sa po bratislavsky povie žaba na šesť?\r\n"Žaba, ne?"\r\nNa osem?\r\n"No žaba, ne?"\r\nNa dvanásť?\r\n"Tak asi žaba, ne?"', 123, 3.75, 55),
	(12775, 'Hlásenie z verejného rozhlasu:\r\nPozor, pozor! Žiadame občanov mesta Krásno nad Kysucou, aby nevyhadzovali smeti za dedinu!', 127, 3.01, 55),
	(12776, 'Janko a Marienka idú spolu do lesa. Tu naraz Marienka zastaví Janka a hovorí mu:\r\n- Janko, sme tu sami, urob mi pamiatku na celý život!\r\nJanko vezme papek a vypichne Marienke oko.', 184, 3.38, 55),
	(12777, 'Ide šéf do firmy, zaparkovať do dvora, keď tu zrazu vidí, že cez celé parkovisko leží dlhá rúra. Tak si zavolá dvoch robotníkov a povie im nech odnesú tú rúru preč. Za hodinu si ide po spisy a vidí,ako tí dvaja sedia na tej tyči. Pýta sa ich:\r\n"Prečo ste ju neodniesli?"\r\nOni na to:\r\n"Ťažká!"\r\nTak si zavolajte ešte troch, štyroch, ale už nech je už preč. Za hodinu si ide šéf po desiatu a vidí ako šiesti robotníci sedia na tyči.\r\n"A teraz máte čo za problém?"\r\nA oni zas:\r\n"Ťažká!"\r\nTak si zavolajte pre mňa za mňa aj desiatich, ale ja tu chcem už parkovať!!! Šéf ide na obed a na tyči sedí pätnasť robotníkov.\r\n"Prečo ste ju ešte neodniesli?"\r\n"Ťažká!"\r\nTak si zavolajte celú fabriku, lebo mi ukradnú auto. Šéf príde po obede a celá fabrika sedí na tyči.\r\n"Len mi nepovedzte, že je ťažká"\r\nA oni na to:\r\n"Nie je KRÁTKA!"', 894, 2.9, 55),
	(12778, 'Malý Janko nachytá rodičov v spálni. Pýta sa otca:\r\n- Oco, čo to robíte?\r\n- Robíme ti bračeka.\r\n- Ale ja nechcem bračeka, prestante!\r\nNa druhý deň sa opakuje to isté, len v inej polohe. Janko opäť príde do spálne a vyhlási:\r\n- A berte na vedomie, že nechcem ani psíka!', 288, 3.23, 55),
	(12779, 'Dežo na stavbe reve na majstra:\r\n- Pán majster, pán majster, pomoc, odtrhlo mi prst.\r\n- Dežo čo si robil?\r\n- Ale tu som to takto... do čerta, aj druhý mi odtrhlo.', 169, 3.47, 55),
	(12780, 'Príde zákazník do obchodu a pýta sa predavačky:\r\n- Máte mrkvu?\r\n- Áno.\r\n- Tak si ju strčte.\r\n- Ako?\r\n- Vnaťou von. ', 124, 3.3, 55),
	(12781, 'Zákazník si v reštaurácii objedná fašírku. Prinesú mu, začne jesť, keď tu zrazu pozerá - veľký čierny chlp. A ešte jeden... Naštve sa, zavolá čašníka a protestuje. \r\n- Viete, - hovorí čašník - náš kuchár je veľmi dobrý, ale nemá jednu ruku a tak musí fašírky miesiť na svojej hrudi a tá je, no viac ako chlpatá, to je pravda. Ale viete čo? Vy máte vlastne šťastie, že ste si neobjednali plnenú papriku...', 447, 3.26, 55),
	(12782, 'Babka sa trepe do autobusu, ten ako vždy natrieskaný do prasknutia, ledva stojí na nohách. \r\n- Chcete si sadnúť babka? - kričí na ňu drzý teenager zo sedadla\r\n- Áno, synku.\r\n- A kde?', 193, 3.43, 55),
	(12783, '- Dedko?\r\n- Čo je vnúčik? \r\n- Máš zuby? \r\n- Nie! \r\n- Tak mi postráž tieto orechy!', 88, 3.07, 55),
	(12784, 'Na slovensku hovorí inteligent hlupákovi:\r\n- Tebe je hej, ty sa presadíš, ale čo so mnou?', 94, 2.93, 55),
	(12785, 'Prečo sa milenec nezmestí pod posteľ?\r\nLebo je tam super bežkár.', 69, 3.18, 55),
	(12786, '- Dežo! Ty hovädo! Ty si mi celú zimu kradol uhlie!\r\n- Fakt? Ja som si myslel, že som sa prevŕtal do uhoľných baní.', 123, 2.57, 55),
	(12787, 'Nápis na náhrobnom kameni: \r\n"Nesmútte, neplačte, ja som vás neopustil, ja som vás len predbehol."', 104, 3.31, 55),
	(12788, 'Viete, kde sú ženy najčiernejšie?\r\nV Afrike.', 48, 2.66, 55),
	(12789, 'Aký je rozdiel medzi svedkom, znalcom a sudcom?\r\nSvedok videl, počul a nevie.\r\nZnalec nevidel, nepočul, ale vie.\r\nSudca nevidel, nepočul, nevie, ale rozhoduje.', 163, 3.15, 55),
	(12790, 'Predavač: "Pán riaditeľ mám pre Vás dve správy, jednu dobrú a jednu zlú správu."\r\nRiaditeľ: "No tak najprv mi povedzte tú dobrú."\r\nPredavač: "Všetky lístky, pane, na večerné  predstavenie Cigánsky barón sú vypredané."\r\nRiaditeľ: "No, to je ale naozaj výborné, a tá zlá správa?"\r\nPredavač: "Všetky lístky vykúpili skíni."', 352, 3.34, 55),
	(12791, 'Ide dedko po ulici a vidí ako dvaja malí chlapci fajčia. Profesorsky a s povýšeneckým hlasom sa ich pýta:\r\n- Chlapci a to vy máte koľko rokov, že tak veselo na ulici fajčíte?\r\n- Osemnásť - odpovie jeden z nich.\r\n- Ha! To by mohol povedať hocikto! - povie dedko.\r\n- Omyl. Vy už nie, dedo.', 303, 3.31, 55),
	(12792, 'Ide dedko po ulici a vidí ako malý chlapec fajčí cigaretu. \r\n- Synku a to ty už fajčíš?!\r\n- Ááále dedko, to iba keď mám vypité.', 141, 2.85, 55),
	(12793, 'Pýta sa otec sedemnásťročného syna:\r\n- Kam ideš? A prečo si so sebou berieš tú baterku?\r\n- Na rande.\r\n- To ja som v Tvojich rokoch žiadnu baterku nepotreboval.\r\n- No, ale pozri sa, čo si si priviedol domov!', 217, 3.41, 55),
	(12794, 'Viete kedy sa farár vzruší? Keď pretiahne omšu.', 52, 3.5, 55),
	(12795, 'Viete, aký je rozdiel medzi bláznom a psychiatrom?\r\nPsychiater má kľúče\r\n', 79, 3.54, 55),
	(12796, 'Chlapec sa naštve a tak vybehne na balkón ušúľa si jointa potiahne si ...prejde žeravá guľa on sa len prizerá...potiahne si znovu a znovu tá guľa ...tak si potiahne tretí krát a zase ta žeravá guľa...až za nim príde kamarát a povie mu..."Poď už dnu ved si tu už tri dni"', 292, 3.75, 55),
	(12797, 'Narkoman sa dostane do pekla pristane na suchom poli...široko ďaleko nič a tu zbadá Boba Marleyho s nádherne zašúľaným jointom. Pristúpi k nemu a bob sa spýta\r\n-Máš oheň?\r\n:Nie nemám.\r\n- To je peklo, čo? ', 220, 3.79, 55),
	(12798, 'Pesimista vidí v tunely tmu, optimista svetlo na konci, realista vidí svetla blížiaceho sa vlaku. Strojvedúci vidí troch idiotov na koľajniciach.', 152, 3.93, 55),
	(12799, 'Na ulici plače chlapček. Príde k nemu pani a pýta sa:"Čo sa ti stalo, maličký?"\r\n"Stratil som sa!"vzlyká.\r\n"A poznáš svoju adresu?"\r\n"Ano. Matej zavináč azet bodka es ka."', 183, 3.48, 55),
	(12800, 'Príde Jano neskoro do práce,\r\n"Majster mu hovorí a pozerá na hodinky"\r\n"Jano sedem padesiat "\r\n"Jano odpovedá "\r\n"Majster také lacné hodinky"\r\n', 150, 3.32, 55),
	(12801, 'Pýta sa Jožo Jana.\r\nKoľko je 5 plus 5?\r\nOdpoveď:10.\r\nNemáš pravdu.Je to 11,90.\r\nNepripočítal si DPH.\r\nHe He nevieš ani malú násobilku!!!!\r\n\n', 151, 3.71, 55),
	(12802, '- Fero! Ten nápadník našej dcéry ťa príde dnes požiadať o jej ruku. \r\nStačí ak mu povieš "áno". Netreba, aby si mu zase v slzách bozkával ruky a oslovoval ho "náš spasiteľ"... \r\n', 195, 3.14, 55),
	(12803, 'Matka porodila dve deti, jednému synovi dala meno Drž hubu a druhému Rozum. Išiel raz Drž hubu nakupovať, a predavačka sa ho pýta: "Chlapec, ako sa voláš?"\r\nChlapec odpovie: "Drž hubu."Predavačka: "Chlapec, povedz ako sa voláš, lebo zavolám policajtov. "Chlapec: "Drž hubu." Prídu policajti a pýtajú sa chlapca: "Tak ako sa voláš?" Chlapec: "Drž hubu."  Policajti: "Povedz ako sa voláš, lebo zavoláme tvoju matku." Chlapec: "Drž hubu."Príde matka a policajti sa jej pýtajú: "Ako sa volá váš syn?" Matka im odpovie: "Drž hubu." Policajti: "Vy nemáte rozum ženská.."Matka: "Mám, píše si doma úlohy."', 637, 3.93, 55),
	(12804, 'Ten kto vie pracuje,\r\nten kto nevie učí,\r\nten kto nevie pracovať ani učiť, sa volá manažér,\r\na ten kto nevie pracovať, učiť a ani nie je manažér, tak ten to všetko vlastní.', 187, 3.75, 55),
	(12805, 'Záhorák hovorí svojej žene.\r\n"Očúvaj stará", blížá sa Ti svátky, kupíme sviňu, zabijeme, budú\r\njitrničky, klobáse, krvavnice.\r\nZrazu sa otočí, čapne synovi po papuli, až ten padne zo stoličky.\r\nŽena sa ho pýta:\r\n"Ná co robíš, šak ti nic nespraviu!\r\n"Už ho vidzím debila, jak to žere bez chleba"!', 325, 4.22, 55),
	(12806, 'Chlapec na diskotéke nevie nadviazať kontakt s dievčaťom, ktoré sa mu páči. Celú noc chodí za ňou a sleduje ju, ale nie je dosť odvážny aby ju oslovil. Ako tak za ňou chodí, ona vojde na záchod, on už odhodlaný, v sebe si hovorí, že už sa určite odváži a osloví ju. Dievča vyjde z WC, chlapec sa rozklepe a pýta sa: "Ahoj, srala si?"', 360, 4.26, 55),
	(12807, 'Príde babka k doktorovi a sťažuje si:\r\n"Pán doktor, všetci moji blízki si sťažujú, že som cítiť. Veď to nie je pravda?"\r\nDoktor babku vyšetrí, predpíše jej lieky a pozve ju za týždeň na kontrolu.\r\nO týždeň si babka opäť sťažuje:\r\nPán doktor ,čo ste mi to dali za lieky? Ja som po nich hrozne cítiť..."\r\nDoktor sa pousmeje a spokojne vraví:\r\n"Výborne, čuch už máme v poriadku. Ešte niečo urobíme s tým sluchom..."', 452, 3.43, 55),
	(12808, 'Príde mladý muž do drogérie a pýta si u predavačky liter inkoustu.\r\nPredavačka mu ho podá, chlap ho vypije a pýta si druhú fľašu.\r\nPredavačka mu ju opäť podá, on ju zasa vypije.\r\nPredavačka celá vydesená mu vraví:\r\n"Preboha, čo to robíte? Veď sa otrávite!!"\r\nA mladý muž jej odpovie:\r\n"Ale to je v poriadku, nebojte sa. Ja sa zajtra žením, a tak si potrebujem naplniť péro..."', 406, 2.6, 55),
	(12809, 'Stretnú sa Ferko a Jožko.\r\nJožko sa spýta Ferka:\r\nJožko, vieš aký je rozdiel medzi fízlom a debilom?\r\nSpoza rohu vyjde policajt, vytiahne obušok a pýta sa:\r\n"No aký, aký?!"\r\nA Jožko mu odpovedá: "Žiadny."\r\nA policajt spokojne odíde.', 248, 4.02, 55),
	(12810, '- Viete čo je totálna staroba?\r\n- Keď vychádzate z múzea a spustí sa alarm.', 81, 3.89, 55),
	(12811, 'Traja záhradkári sa medzi sebou vychvaľujú, kto vypestoval najväčšie jablko. Prvý vraví: "Moja dvojročná jabloň rodí jablká veľké ako lopta...""To nie sú veľké jablká" - hovorí mu druhý. "Moja jabloň má jablká veľké ako stolička.""A s tým sa chválite?" - vraví tretí. "Ja mám ročnú jablonku a tá ma také plody, že keď som ich minule skladal na voz, z jedného jablka vyliezol červík a zožral mi koňa."', 444, 3.76, 55),
	(12812, 'Učiteľ sa pýta žiakov:"Už z vás niekto zachránil niekomu život?"Prihlásil sa Ferko: "Ja, prosím. Svojej sestričke, keď som raz mame ukryl antikoncepčnú tabletku."', 176, 3.9, 55),
	(12813, 'Hosť vraví čašníkovi:\r\n- Pán hlavný, prosím vás, nedalo by sa to kurča dopiecť?\r\n- Zdá sa vám málo upečené?\r\n- Čo ja viem, len mi z taniera vyzobáva zemiaky.', 175, 3.89, 55),
	(12814, 'Príde k babke na dedinu do domu po sťažnostiach od susedov hygienik a vykonáva kontrolu, či sa oznámenie na babku, že je humusáčka zakladá na pravde. Pozve teda babka hygienika do domu a zavedie ho do obývačky, kde hygienik sa obzerá a stále krúti hlavou. Asi po minúte to nevydrží a povie babke: "Babka, vy tu ale máte bordel."\r\nBabka odpovie: "Ále kdeže" -  a kopne hovno pod posteľ.', 407, 3.8, 55),
	(12815, 'Na Slovensku žijú len dva druhy ľudí – normálni a špekulanti: \rNormálni - chodia na dovolenku do Egypta, na Maledivy, každé 4 roky menia auto za nový model, stravujú sa v reštauráciách, pozerajú televízne noviny na svojich 100 cm plazmách a počúvajú svoje hi-end stereo. \rŠpekulanti - špekulujú nad tým, ako prežiť od výplaty k výplate.', 366, 3.43, 55),
	(12816, 'Prečo ľudia žijú? Lebo nemajú nič iné na práci len znečisťovať životné prostredie.', 95, 3.53, 55),
	(12817, 'Ľudstvo odjakživa zaujímajú dve otázky:\r\n1.) Kto vymyslel prácu?\r\n2.) Ako to, že ho ostatní nezabili?', 109, 4.11, 55),
	(12818, 'Vozičkárovi pri prechode cez železnicu sa medzi koľajami zasekne koleso. \r\nZrazu sa spoza zákruty začne rútiť vlak. Vozičkár začne kričať na rampára. Rampár nikde.\r\nVozičkár: Rampáááááá.\r\nRampár nikde.\r\nVlak je 200 metrov od vozičkára.\r\n- Rampáááááár.\r\nRampár nikde.\r\nVlak je 50 metrov od vozičkára.\r\n- Rampááááár. \r\nVtom sa z okna vystrčí rampár.\r\n- Čo je???\r\n- Už nič pozeraj sa na tú šľahu.', 442, 2.95, 55),
	(12819, 'Učiteľka chce naučiť deti narábať s peniazmi, a tak dá každému 10 korún, za ktoré si majú niečo kúpiť. Na druhý deň sa ich pýta, ako rozumne vynaložili s peniazmi.\r\nChváli sa Anička:\r\n- Prosím pekne, ja som kúpila čerešne. Všetky som zjedla, kôstky som zasadila a idem čakať na úrodu.\r\n- Múdro Anička. A čo ty Jožko?\r\n- Ja som kúpil marhule, a kôstky som zasadil.\r\n- Výborne Jožko. ... a ty Móricko?\r\n- Ja som kúpil jaternicu.\r\n- S pánom bohom, jaternicu a to už čo je na tom rozumné?\r\n- No, tak večer sa s ňou sestra sexuálne ukojila, potom sme ju zjedli, črevo otec použil ako kondóm, ráno sme sa do neho vykakali, mama to išla reklamovať, a tu máte naspäť tých desať korún, pani učiteľka.\r\n', 754, 4.12, 55),
	(12820, 'Chuck Norris nepotrebuje kaderníka, kaderník potrebuje Chucka Norrisa.', 72, 3.32, 55),
	(12821, 'Hosť: "Pán vrchný, kde je môj obed?"Čašník: "Prepáčte, zabudol som na vás. Vy ste ten pán s teľacím mozočkom?"\r\n', 126, 3.33, 55),
	(12822, 'Čo si spieva učiteľka keď príde do triedy so samými päťkami z písomky?Teď kráľovnou jsem jááá...', 111, 2.96, 55),
	(12823, 'Príde fixka k doktorovi a vraví:"Pán doktor, nemohli by ste ma vypísať?"', 77, 3.3, 55),
	(12824, 'Winnetou vyšiel zo svojho stanu a hneď na to dostal veľkú ranu medzi oči, až klesol na zem. O chvíľu zo stanu vyšiel Old Shatterhand, tiež dostal ranu medzi oči a klesol k zemi... Winnetou vraví:\r\n- Môj biely brat tiež stúpil na hrable?   ', 254, 4.21, 55),
	(12825, 'Ide skinhead do obchodu a pýta si chlieb.\r\nPredavačka sa ho pýta: "Čierny alebo biely?" A skinhead na to: "Neprovokuj!!"', 124, 3.93, 55),
	(12826, 'Ide slepý, hluchý a koktavý na mrakodrap.\r\nKoktavý začne koktať na 15-tom poschodí. „Ku, ku, ku,...“  „Nehreš“ hovorí mu slepý.  Prídu na 95 poschodie, koktavý začne opäť koktať a zase mu slepý povie „Nehreš.“\r\nPrídu na 145 poschodie, koktavý sa konečne vykoktá a povie: „Ku, kufre sme zabudli.“\r\n', 335, 4.22, 55),
	(12827, 'Koľkí tu pracujete na stavbe?\r\nS majstrom piati.\r\nteda bez majstra štyria, že?\r\nNie. Bez majstra nikto.', 107, 4.12, 55),
	(12828, 'Príde muž do obchodu a pýta sa: "Koľko stojí ten pes?"\r\nPredavačka mu hovorí: "Ja neviem prečo si nesadne."\r\n"Ale ja sa pýtam, koľko stojí ten pes!\r\n"No už dobrú polhodinu."', 186, 3.87, 55),
	(12829, 'Haló.\r\n- Prepáčte, je to číslo deväť, tri, štyri, tri, sedem, sedem, osem, päť, štyri?\r\n- Nie, áno, nie, áno, áno, nie, nie, áno, nie.', 149, 4.17, 55),
	(12830, 'Muž na smrteľnej posteli. "Žena moja, tu si?" "Tu som , muž môj, tu som." "Svokra moja, tu si?" "Tu som zať môj, tu som." "Deti moje, tu ste?" "Tu sme otec, tu sme". "Tak ktorú p*ču sa svieti na tej chodbe?"', 216, 4.05, 55),
	(12831, 'Hádajú sa tri sliepky - česká, slovenská a nemecká -  ktorá z nich znesie viac vajec.\r\n- Ja znesiem denne 5 vajec - chváli sa česka sliepka.\r\n- Ja znesiem denne 10 vajec - chváli sa nemecká sliepka. Slovenská vraví:\r\n- Cha! Načo by som si namáhala prdelku, keď sa dajú kúpiť v obchode!', 304, 3.39, 56),
	(12833, 'Orol sa pol dňa spúšťa z vysokého brala strmhlav dole a len testne nad zemou roztiahne krídla a zasa to zdvihne. Vidí ho vrabec, tak sa ho pýta: \r\n- Orol, čo to robíš? \r\n- Hm, mám na háku... \r\nTak si vrabec pomyslí "cool zábava": \r\n- Tak môžem ísť s tebou? \r\n- Ok. \r\nTak tam strmhlav padajú dole z vysokého brala a zbadá ich medveď. Keď sú opäť hore na brale, pýta sa ich: \r\n- Hej chlapi, čo to robíte? \r\n- Mame na háku... \r\nTak si aj medveď pomyslí "cool zábava": \r\n- Môžem sa k vám pridať? \r\n- Jasnééé... \r\nTak padajú všetci traja strmhlav z brala a keď sú tak 20m nad zemou, tak sa vrabec pozrie na medveďa a hovorí: \r\n- Hej medveď, však ty nemáš krídla!? \r\n- Nemám... \r\n- Nóóó tak ty máš ináč na háku...', 768, 3.84, 56),
	(12834, 'Hádanka: Prečo stojí bocian na jednej nohe? \r\nLebo keby dvihol aj tu druhú, tak by padol.', 93, 3.14, 56),
	(12835, 'Zajac si zastane v strede lesa a zakričí:\r\n- Kto sa chce so mnou biť?\r\nOkamžite sa zbehnú všetky zvieratká a medveď podíde k nemu. Zajac sa naňho pozrie a zakričí:\r\n- Výborne. A kto sa chce biť so mnou a s medveďom?', 230, 3.27, 56),
	(12836, 'Je sychravá, mrazivá jeseň. Medveď si spokojne podriemkáva, keď ho zobudí veľký buchot. Otvorí dvere a tam stojí malý slimáčik a prosí:\r\n- Medveď, je strašné počasie a mne je hrozná zima, pusti ma prosím ťa zohriať sa. \r\nNamrzený medveď odkopne slimáčika a zabuchne dvere. Prejde jeseň, zima, leto a zas je jeseň. Medveďovi zrazu opäť niekto búcha na dvere. Otvorí ich a tam opäť slimáčik. Skôr ako medveď otvorí ústa, nazlostený slimáčik vykríkne:\r\n- Medveď, a to malo byt čo?', 525, 3.66, 56),
	(12837, 'Hovorí vlk líške:\r\n- Ty Líška, poď, zbijeme Zajaca.\r\n- Ale aký budeme mať dôvod?\r\n- Keď bude mať na hlave čiapku preto, keď nie, preto.\r\nIdú a strašne zbijú zajaca.\r\nNa druhý deň vlk zase začne:\r\n- Ty Líška, poď zbijeme Zajaca.\r\n- A dnes zase prečo?\r\n- Vypýtame si od neho cigaretu. Ak nám dá s filtrom preto, ak bez filtra, preto.\r\nPrídu k Zajacovi a vlk hovorí:\r\n- Zajac, daj nám cigaretu!\r\nNa čo Zajac:\r\n- A chcete s filtrom alebo bez filtra.\r\n- Pozri sa na hajzla, zase nemá čiapku!', 518, 3.73, 56),
	(12838, 'Ak má slon slonicu, krab má krabicu, prasa sa oprasí a žralok sa - ožerie?', 79, 3.69, 56),
	(12839, 'Slon stúpi do mraveniska a mravce po ňom začnú liezť. Slon sa otrazie ale jeden mravec mu ostane visieť na krku. \r\nOstatní po ňom z dola kričia: \r\n"Zaškrť ho zaškrť ho !!!"', 185, 3.63, 56),
	(12840, 'Mladý komár hovorí matke:\r\n- Mami, chcem ísť dnes do opery. Pusť ma.\r\n- V žiadnom prípade.\r\n- Ale ja  chcem! Ináč ujdem z domu!\r\n- No dobre, ty nešťastník, len ťa prosím dávaj si strašný pozor pri potlesku!', 224, 3.29, 56),
	(12841, 'Dva hady v púšti:\r\n- Počuj, my sme jedovaté?\r\n- A čo ja viem? Prečo?\r\n- Práve som si zahryzol do jazyka', 110, 3.51, 56),
	(12842, 'Ufrflaná žaba si sadne na papuľu krokodílovi a hovorí: \r\n- To je v riti. Komárov málo, voda studená a ešte aj krokodíl sa mi prilepí na riť! ', 153, 3.3, 56),
	(12843, '- Tak čo, tetuška, ako funguje vaša stará pascička na myši?\r\n- Úplne super. Ráno sa tej staromódnej technike tri myši posmievali, až se urehotali k smrti!', 165, 3.21, 56),
	(12844, 'Zajačik vojde do cukrárne, objedná si dva banány a mrkvový džús. Džús vypije a banány na veľký údiv predavačky si strčí do uší. Príde druhý deň a zopakuje to isté. Tretí deň predavačka to už neznesie a povie mu, že banány sa minuli. \r\n- Tak mi dajte dve mrkvy a pomarančový džús. \r\nDžús vypije a mrkvy si strčí do uší. Totálne vykoľajená predavačka sa ho pýta:\r\n- Preco si strkáš tie mrkvy do uší?\r\n- Keď nemáte banány...', 471, 3.32, 56),
	(12845, 'Zajac urobí megapárty v lese a pozve všetky zvieratá. Prišli všetci, len stonožka chýba. Zábava v plnom prúde, pomaly už aj končí, keď sa \r\nvovalí dovnútra stonožka a strašne nadáva:\r\n- Do riti, všetko som zmeškala! Ktorý idiot napísal na dvere "Dobre si utrite nohy!"?', 292, 3.76, 56),
	(12846, 'Čo potrebuje slon, keď má hnačku?\r\nHlavne veľa miesta.', 59, 3.31, 56),
	(12847, 'Dve stonožky obdivujú poster známej sexbomby.\r\n- Krásne nohy!\r\n- Namôjdušu, ale akosi málo...', 100, 3.31, 56),
	(12848, 'Naháňa kohút sliepku po dvore. Sliepka si hovorí: \r\n- Pobehnem ešte chvíľu, nech si nemyslí že som štetka.\r\nKohút si hovorí: \r\n- Keď z toho nič nebude, tak si aspoň zašportujem.', 193, 3.35, 56),
	(12849, 'Visia tri netopiere na strome. Zrazu sa jeden z nich postaví a druhý sa pýta tretieho:\r\n- Čo sa mu stalo?\r\nA on mu na to odpovedá: \r\n- Neviem, asi odpadol.', 160, 3.67, 56),
	(12850, 'Sedí zajac pod stromom a fajčí.\r\nPrejde okolo neho krava a povie:\r\n"Taký malý a fajčí!"\r\nZajac odpovie:\r\n"Taká veľká a bez podpersenky!"', 146, 3.93, 56),
	(12851, 'Ide strašne nasraté prasiatko po lese, stretne dobrú vílu a tá ho osloví:\r\n- Kdeže ideš prasiatko a čože si mi také namosúrené? A aby si mi nebolo, splním ti tri želania ...\r\nPrasiatko na to:\r\n- chŕ chŕ chŕ ... zdochni, zdochni, zdoóchniíí ...', 264, 3.36, 56),
	(12852, 'Stretne slon nahého chlapa a strašne sa začne rehotať. Plieska chobotom o zem a rehoce sa a rehoce.\r\n- Čo je? Máš problém? - pýta sa urazený chlap\r\n- Nie, to nie, ja len nechápem ako s takým malým môžeš jesť...', 227, 3.35, 56),
	(12853, 'Ako sa rozmnožujú ježkovia?\r\nVeľmi opatrne.', 47, 3.39, 56),
	(12854, 'Rozprávajú sa dve kravy. Jedna hovorí druhej:\r\n- Ach, čo s nami bude, veď všetci vyhynieme.\r\nA tá druhá krava:\r\n- Vrrrrrrrrr, ja som vrtuľník, mne to nevadí. Vrrrrrr...', 179, 2.61, 56),
	(12855, 'Malé dievčatko chytí lienku a pýta sa jej:\r\n- Lienka, lienka, aké bude zajtra počasie?\r\nLienka sa pozrie na dievčatko a povie jej:\r\n- Počúvaj ma malá, čo som ti ja meteorologická stanica?', 199, 3.26, 56),
	(12856, '- Haló? Tam je ZOO? Váš telefón mi dali zo záchrannej služby. Do bytu sa mi dostala vretenica.\r\n- Ako sa dostala? Do bytu? Cez ventiláciu? Kde bývate? ... ... Na čo sa podobá? (100 otázok)\r\n- Cez ventiláciu ... ... (100 odpovedí) ... Podobá sa na užovku, no ja nie som špecialista...\r\n- Opíšte ju.\r\n- No je čierna, stredne dlhá... taká obyčajná.\r\n- To je užovka. Ak sa nebojíte, tak ju skúste chytiť.\r\n- Čím? Holými rukami?\r\n- Jednoducho ju chyťte! Holými rukami, alebo...\r\n- Čo alebo?\r\n- Vy ste členom Zväzu ochrancov prírody?\r\n- Nie.\r\n- Tak ju jebnite lopatou!', 598, 3.41, 56),
	(12857, 'Je skoro ráno, slniečko už vyšlo a malý slimáčik lezie po strome. Lezie, lezie až spadne. Opäť sa však pozbiera zo zeme a lezie po strome. A tak celý deň len lezie a padá, lezie a padá. Je už večer a na vedľajšom konáriku sedia dvaja vrabci.  Ten jeden hovorí tomu druhému:\r\n- Miláčik, nemali by sme mu povedať, že je adoptovaný?', 356, 3.68, 56),
	(12858, 'Ide medveď po lese. Zastaví ho zajac a pýta sa ho:\r\n- Nožík máš?\r\nMedveď prekvapený povie:\r\n- Nie.\r\n- Tak choď preč.\r\nMedveď nahnevaný ide po vlka a opäť ich zastaví zajac a pýta sa ich:\r\n- Nožík máte?\r\n- Nie.\r\n- Tak chodte preč.\r\nMedveď s vlkom nahnevaný idú po ostatné zvieratá do lesa a opäť ich zastaví zajac a pýta sa:\r\n- Nožík máte?\r\n- Nie.\r\n- Tak chodte preč!\r\nPotom prídu všetci s nožíkmi v ruke a zajac ich zastaví a  pýta sa ich.\r\n- Nožík máte?\r\nZvieratá  hrdo povedia:\r\n- Hej.\r\nA zajac na to:\r\n- Tak chodte preč!', 568, 3.4, 56),
	(12859, 'Pri okienku v banke sedí vrana s visiacou kvapkou na zobáku a hovorí pokladníčke: \r\n- Navaľ prachy, lebo kychnem!', 119, 3.49, 56),
	(12860, 'Letí vrana po lese a kráka si:\r\n\'Krá, krá, krá.\'\r\nZrazu vrazí do stromu:\r\n\'Čvirik, hrkú, Bože ako to bolo?\'', 116, 4.02, 56),
	(12861, '- Miško, vieš povedať dve zvieratá na x?\r\n- Xes a xrana.', 60, 2.58, 56),
	(12862, 'Spadne agresívne prasiatko do jamy. Ide okolo vlk a hovorí:\r\n- Prasiatko, čo sa ti stalo?\r\nA prasiatko hovorí:\r\n- Ako čo sa stalo? Čo nevidíš? Kretén!\r\nVlk odíde. Ide okolo líška a pýta sa prasiatka:\r\n- Čo sa ti stalo prasiatko?\r\nA agresívne prasiatko hovorí:\r\n- Ako čo sa mi stalo? Čo už ste všetci oslepli či čo?\r\nLíška odíde. Viac zvierat sa tam zastaví a pýtajú sa ho, čo sa stalo. Agresívne prasiatko sa nevedelo vyškriabať hore lebo jama bola hlboká. Nakoniec ide okolo medveď a pýta sa agresívneho prasiatka, čo sa mu stalo a potom mu hovorí, nech čaká, že ide po pomoc a prasiatko hovorí:\r\n- Nepočkám.', 653, 2.71, 56),
	(12863, 'Dve sovy sedia na strome a jedna:\r\n- Huuuuu.\r\nA druhá.\r\n- Svoju mater si straš.', 81, 3.53, 56),
	(12864, 'Rozprávajú sa tri zvieratká, ktoré z nich je najhrôzostrašnejšie. Začne pes:\r\n- Ja keď zaštekám, všetky mačky z okolia zdrhnú preč.\r\nPotom lev:\r\n- To ja keď zarevem, všetky zvieratá aj ľudia z okolia zdrhnú.\r\nA nakoniec malé kuriatko:\r\n- Na mňa nemáte! Ja keď sa zvalím na chrbát, celá Európa sa poserie!', 332, 3.65, 56),
	(12865, 'Zajačik potrebuje lopatu a tak si ju ide požičať k líške. Ako tak ide hovorí si: \r\n"Tá líška je ale riadna sviňa, určite mi ju nepožičia."\r\nIde ďalej, už je bližšie k nore a zasa hovorí: \r\n"Tá líška je ale riadna sketa, určite mi ju nepožičia." \r\nUž je takmer pred norou a vraví: \r\n"Tá líška je ale riadna krava určite mi ju nedá."\r\nPríde k nore a zaklope. Líška otvorí a pýta sa: \r\n"Čo si praješ zajačik?"\r\nZajac chytí tehlu a drb líške do hlavy. \r\n"Tak si ju nechaj ty krava!!!"', 523, 3.7, 56),
	(12866, 'Idú dva ľadové medvede po púšti a jeden hovorí:\r\n- Tu muselo riadne snežiť, keď to tak posypali.', 105, 3.4, 56),
	(12867, 'Dva komáre sa pasú na ramene Robinsona Crusoea. Jeden z nich docicia a vraví:\r\n- Ja už mám dosť. Uvidíme sa. Na Piatok.', 126, 2.87, 56),
	(12868, 'Vieš, akú má had výhodu?\r\nNemusí čakať v rade na ponožky.', 65, 2.91, 56),
	(12869, 'Stretnú sa dvaja muži, ktorí venčia psov. Jeden venčí pitbulla a druhý pudlíka. Pitbull už začne vrčať na pudlíka a muž ho pustí. Aj druhý pustí pudlíka. Pudlík roztrhá pitbulla a muž, ktorý ho venčil sa spýtal druhého:\r\n- Koľko ste dali za toho psa?\r\n- Sto tisíc.\r\n- Sto tisíc za psa?\r\n- Päťdesiat tisíc za krokodíla a päťdesiat za plastiku.', 376, 3.57, 56),
	(12870, 'Hádanka:\r\nNa ceste leží dlhá rúra. Jedna mačka sa pozerá z jednej strany a druhá mačka z druhej strany. Prečo sa tieto dve mačky nevidia? \r\nPretože jedna mačka sa pozerá v pondelok a druhá v utorok! ', 214, 3, 56),
	(12871, 'Ktoré zviera je najprítulnejšie? \r\nPytón. Keď sa raz pritúli, tak ťa až do smrti nepustí.', 98, 3.37, 56),
	(12872, 'Stretne jeleň ježka a vraví mu:\r\n- Ježko, poviem ti básničku. Jež, jež, jež, na hlave máš pleš.\r\nJežko na to:\r\n- A ja ti tiež poviem. Jeleň, jeleň, jeleň, ty si ale debil!', 188, 3.58, 56),
	(12873, 'Rozprávajú sa dvaja slimáci. Jeden hovorí druhému:\r\n- Pred pol rokom mi ušla žena aj s dieťaťom a ja ich ešte táámto stále vidím!', 143, 3.37, 56),
	(12874, 'Dva barany sledujú, ako bača strihá ovce. Starší povie mladšiemu:\r\n- Pozri, teraz bude poriadny striptíz. ', 113, 3.1, 56),
	(12875, 'Medveď, riaditeľ lesa kontroluje, či nie je v lese bordel a vidí ožratého zajaca.\r\n"Zajac! Ty si opitý! Budem ťa musieť zastreliť!"\r\n"Prosím ťa, prepáč mi, už sa to viackrát nestane."\r\nTak ho medveď nechá, ale na druhý deň pozerá a zajac zase zrytý ako rúra.\r\n"Zajac, tak ale toto si prehnal! Kde ja tá puška?!"\r\n"Nie, prosím ťa, to je už posledná rozlúčka s alkoholom."\r\nTak ho zase nechá a na tretí deň ide zase na obhliadku. Nikde nevidí zajaca, tak sa ide celý spokojný napiť vody do potoka. A vo vode ožratý zajac! Nasratý medveď už aj vyťahuje flintu a zajac hovorí:\r\n"Ho-ho-ho, maco! Zvieratám v lese môžeš rozkazovať, ale nám rybičkám nieeee!"', 704, 3.6, 56),
	(12876, 'Medveď si urobil zoznam zvierat, ktoré zožerie. Dozvedeli sa to zvieratká a ako prvá za ním prišla líška:\r\n"Medveď, chceš aj mňa zožrať?"\r\n"Hej!"\r\n"A môžem sa ešte ísť rozlúčiť s rodinou? Potom prídem a môžeš ma zožrať."\r\n"O.K."\r\nPo nej prišiel vlk:\r\n"Medveď, som aj ja na zozname?"\r\n"Hej!"\r\n"A môžem sa ešte ist rozlúčiť s rodinou a povybavovať ešte zopár vecí? Potom prídem a zožerieš ma."\r\n"Dobre."\r\nA nabehol zajo:\r\n"Medveď, som aj ja na zozname?"\r\n"Jasne."\r\n"A mohol by si ma vyškrtnúť?"\r\n"Tak dobre."', 553, 3.8, 56),
	(12877, 'Priletí vrabec k druhému a pýta sa ho:\r\n- Vieš kto je pod nami? \r\n- Nie.\r\n- Policajt.\r\n- Tak na čo čakáš? Serme.', 120, 3.5, 56),
	(12878, 'Krtko sa vyhrabe spod zeme a pred ním leží na pláži žena s roztiahnutými nohami. Krtko zavolá:\r\n"Ježko."\r\nNič. Opäť sa zahrabe a vyjde bližšie pri žene. Zavolá: \r\n"Ježko."\r\nNič. Tretí krát sa vyhrabe pri kolenách a volá: \r\n"Ježko, žiješ?"', 263, 3.22, 56),
	(12879, 'Korytnačka lezie na strom. Lezie raz, lezie druhýkrát, lezie tretíkrát... Na strome sedí kukučka s kukučiakom. Kukučiak hovorí kukučke:\r\n- Už by sme jej mohli povedať, že je adoptovaná.', 200, 2.99, 56),
	(12880, 'Príde myš so slonom za kráľom zvierat. Slon hovorí:\r\n"My sa chceme vziať."\r\nLev sa začne smiať, že to nejde.\r\n"Ale keď my musíme!"', 141, 3.24, 56),
	(12881, 'Príde prasiatko k elektrickej zásuvke a povie:\r\n"A teba tu zamurovali?"', 73, 3.51, 56),
	(12882, 'Nasraté prasiatko ide po lese a stretne líšku. Líška mu hovorí:\r\n- Ahoj prasiatko, ako sa máš?\r\nA nasraté prasiatko na to:\r\n- Čo sa do mňa staráš, ty stará vyplznutá ryšavá smradľavá chudera!\r\nLíška sa otočí a nasraté prasiatko ide ďalej. Zrazu stretne vlka a ten mu tiež hovorí:\r\n- Ahoj prasiatko, ako sa ti vodí? Už sme sa dlho nevideli.\r\nNasraté prasiatko:\r\n- Nestaraj sa do mňa ty sivý prašivý blcháč!\r\nNasraté prasiatko ide ďalej lesom a stretne vílu. Víla mu hovorí:\r\n- Vieš čo prasiatko? Dnes si bolo ozaj protivné. Nesplním ti tri želania ale iba dve. Hovor!\r\nPrasiatko:\r\n- Tak dobre. Chcem jamu 3 krát 3 krát 3 metre a plnú hovien.\r\n- Máš ju mať. A tvoje druhé želanie?\r\n- A teraz si to zožer ty krava priesvitná!', 778, 3.59, 56),
	(12883, 'Leží mucha na stole a trepe nohami. Letí okolo druha a pýta sa:\r\n- Aerobik, aerobik?\r\n- Biolit, biolit!', 107, 3.49, 56),
	(12884, 'Pýta sa prasa elektrickej zástrčky v stene:\r\n- A teba som kto zamuroval?', 75, 2.94, 56),
	(12885, 'Ide dážďovka po ceste a stretne druhú, ktorá sa jej veľmi páči a tak hovorí:\r\n- Ty si taká pekná, no ja sa do teba asi zaľúbim.\r\nOna na to:\r\n- Neblázni, veď ja som tvoj druhý koniec.', 198, 3.13, 56),
	(12886, 'Macko Pu vojde do mäsiarstva a pýta sa:\r\n"Máte šunku?"\r\n"Máme."\r\nMacko Pu vytiahne devinu, vystrieľa ju do predavača.\r\n"To je za prasiatko..."', 149, 3.64, 56),
	(12887, 'Jožko je po prvý krát v ZOO so svojim oteckom. Keď prídu k jeleňom, Jožko zakričí:\r\n- Oci, ten jeleň nám ukradol vešiak.', 132, 2.61, 56),
	(12888, 'Sedí si žaba na kameni a kváka si:\r\n- No teraz, keď už beriem tie tabletky, tak už sa nemusím báť bociana.', 115, 2.87, 56),
	(12889, 'Pýta sa opička:\r\n- Mamka, prečo sme my opice také škarede? \r\nMama: \r\n- To nič, ale keby si videla toho, čo toto teraz číta.', 132, 3.14, 56),
	(12890, 'Zajac príde do krčmy a kričí:\r\n"Kto zmlátil Vlka?"\r\nMedveď vstane:\r\n"Ja!"\r\nZajac:\r\n"Tak mu treba!"', 104, 3.29, 56),
	(12891, '- Viete prečo nemôžu diviaky na pláž?\r\n- Lebo ľúbia žalude.', 67, 3.1, 56),
	(12892, 'Zvieratka sa dohodli že si postavia penzión. Slon ako najsilnejší sa stal vyhadzovačom. Urobili si párty, a ráno sa slon zobudí,príde na záchod a vydí rozbité okno.\r\nZvolal si všetky zvieratá a opýtal sa či mu ktomu vie niekto niečo povedať.\r\nZajko sa príhlásil:\r\n"Ja viem."\r\n"No zajko ako to bolo?"\r\n"Bola párty a išiel som na záchod kde bol medveď a opýtal sa ma. Zajko pĺzneš? Ja hovorím že nie. Tak si so mnou vytrel zadok a vyhodil ma von oknom."\r\nSlon hovorí medveďovi.\r\n"Medveď zaskli okno a už nech sa to neopakuje."\r\nO týždeň sa párty zopakovala. Sloník prišiel na záchod bol totálne rozbitý. Zvolal všetky zvieratká a spýtal sa či mu vie niekto o tom niečo povedať. Zajko sa ozval že vie.\r\n"No zajko ako to bolo teraz?" \r\n"Včera bola párty, trochu som si vypil a išiel som na záchod. O chvíľku prišiel medveď a opýtal som sa ho či pĺzne. Odpovedal že nie, tak som si sním vytrel zadok a viac si už nepamätám."', 984, 3.72, 56),
	(12893, 'Domáce zvieratká súťažia, ktoré z nich vie vyzerať najhrôzostrašnejšie. Hovorí prasiatko:\r\n- Vyváľam sa v blate, začnem krochkat a pobehovať. Každý, kto ma uvidí sa zľakne a utečie odo mňa.\r\nHovorí býk:\r\n- Hlavu zdvihnem vysoko, pofučím trochu, pobehujem po lúke, rozoženiem všetky\r\nkravy a ovce...\r\nHovorí kuriatko:\r\n- Budem sa správať, akože som zdochlo a polovica krajiny bude posratá od strachu.', 432, 3.75, 56),
	(12894, 'Ako získame sušené mlieko?\r\nNedáme krave dva týždne napiť a potom jej vyprášime vemeno!', 96, 3.24, 56),
	(12895, 'Zvieratká si v lese postavia drevené WC. Na druhý deň je WC rozbité. Hneď zvolajú schôdzu a lev sa pýta čo sa stalo.  Vlk sa prihlási a vraví: \r\n- Je mi to trápne, no keď som bol na WC, prišiel medveď, vysral sa a poutieral si so mnou zadok. Potom ma vyhodil cez strechu von.\r\nZvieratká opravili WC, no na druhý deň bol znovu rozbitý. Zasa sa zvolala porada a lev sa znovu pýta, čo sa stalo.  Prihlási sa líška a hovorí: \r\n- Je mi to trápne, no stalo sa mi to isté, čo aj vlkovi. \r\nWC sa opravilo znovu. Na na ďalší deň z WC neostalo nič. Znova schôdza a tradičná levova otázka. Prihlási sa ježko a hovorí: \r\n- Je mi to trápne...', 671, 3.38, 56),
	(12896, 'Rozprávajú sa dvaja žabiaci:\r\n- Kvak, myslím, že v tomto meste sme už pretiahli všetky baby.\r\n- Kvak, to teda hej, ale čarodejníkovu ženu si si mohol odpustiť!', 170, 3.59, 56),
	(12897, 'Ako spácha mačka samovraždu?\r\nStrelí sa deväť krát do hlavy.', 67, 3.04, 56),
	(12898, 'Dva slepé kone stoja v stajni a jeden hovorí druhému:\r\n"Ty počúvaj, bežíš tento rok Veľkú Pardubickú?"\r\n"Samozrejme, nevidím v tom žiadne prekážky."', 163, 3.4, 56),
	(12899, 'Malý dinosaurus sa pýta mamičky:\r\n- Mami, keď zomrieme, tak sa dostaneme do neba?\r\n- Nie, do múzea.', 104, 3.26, 56),
	(12900, 'Viete, aký je to pes obranár?\r\nChytíš psa za zadné nohy a obúchaš ho o bránu.', 85, 3.04, 56),
	(12901, 'Viete, ako chytíte leva?\r\nChytíte zajaca a dovtedy ho budete mlátiť, kým sa neprizná, že je lev.', 103, 3.84, 56),
	(12902, 'Komár a slonica sa milujú. Slonici vletí do chobota osa a poštípe ju. Tá začne od bolesti strašne revať. Komár spokojný sám so so sebou povie: \r\n- Len krič, maličká, len krič!', 191, 3.43, 56),
	(12903, 'Slon a slonica sa prechádzajú. Majú zamilovane stočené choboty. Odrazu slonica zastane a povie:\r\n- Počuj, dúfam, že ma nevodíš za nos!', 144, 3.43, 56),
	(12904, 'Sedia dve muchy na kravskom lajne. Jedna z nich si prdne. Druhá na to: \r\n- Fuj, že sa nehanbíš! A pri jedle!', 112, 3.52, 56),
	(12905, 'Narodí sa malá moľa. Matka ju pošle na prvý let a keď sa vráti domov, pýta sa jej:\r\n- No čo, ako bolo?\r\nMalá odpovedá:\r\n- Perfektne, všetci mi tlieskali.', 165, 3.65, 56),
	(12906, 'Zajac sedí na pníku a zrazu okolo neho prebehne jeleň a hovorí mu:\r\n"Zajac utekaj rýchlo preč,súdruhovia prišli na polovačku!!!"\r\n"Ale kam by som utekal,veď sú ožratí,že netrafia ani slona !!!"\r\n"Netrafia,ale keď tu budeš takto sedieť,tak Ta pozvracajú."', 272, 3.29, 56),
	(12907, 'Kráľ zvierat - lev si zavolá všetky zvieratá a povie im:\r\n- Všetky pekné zvieratá sa postavia na pravú stranu a všetky múdre na ľavú stranu.\r\nA žaba povie:\r\n- A ja sa mám roztrhnúť alebo čo?', 208, 3.36, 56),
	(12908, 'Naháňa kohút sliepku. Vtom vyjde na dvor gazdiná kŕmiť hydinu. Kohút sa zvrtne, zabudne na sliepku a pažravo začne žrať. Vidiac to gazda, vzdychne si.\r\n- Tak taký hladný by som v živote nechcel byť!', 213, 2.82, 56),
	(12909, 'Do krokodílovho jazierka chodí žaba na ryby. Krokodíl sa na to nahnevá a v duchu si povie.\r\n\'Opýtam sa žaby, či mi chodí na ryby. Keď odpovie áno, zožeriem ju, lebo je drzá a keď odpovie nie, zožeriem ju aj tak, pretože klame.\r\nNa druhý deň si stráži krokodíl svoje jazierko a keď príde žaba, pýta sa jej.\r\n- Žaba, chodíš mi na ryby?\r\nŽaba sa naňho pozrie a odpovedá.\r\n- Vieš čo krokodíl, choď do riti!', 437, 3.49, 56),
	(12910, 'Lev si zvolal na poradu všetky zvieratká z lesa a hovorí im: \r\n- No zvieratká, zajtra ideme na výlet.\r\nA žaba po ňom škriekavým hlasom opakovala:\r\n- No zvieratká, zajtra ideme na výlet.\r\nA lev pokračuje:\r\n- Zajtra o 7:00 hod sa tu stretneme.\r\nA žaba zasa opakuje: \r\n- Zajtra o 7:00 hod sa tu stretneme.\r\nLev sa škaredo pozrie na žabu a povie:\r\n- No a to zelené zviera s tou veľkou papuľou nepôjde nikam.\r\nA žaba nato:\r\n- Chudák krokodíl a ten sa tak tešil...', 481, 3.72, 56),
	(12911, 'Čo je maximálne sucho? \r\nKeď se slimák musí urobiť, aby sa pohol z miesta.', 80, 3.15, 56),
	(12912, 'Mama zajačica sa vrátila z obchodu a vidí malého zajka obzerať si tvár pred zrkadlom. Tak jej to nedá a spýta sa ho:\r\n- Zajko, akné?\r\n- Nie, broky!', 156, 3.61, 56),
	(12913, 'Lesné zvieratká sa dohodli, že už nebudú chodiť vyprázdňovať sa len tak po lese, ale že si postavia latrínu. A tak aj urobili. Postavili peknú drevenú, so srdiečkom na dverách a vetracím okienkom. A tak začali latrínu navštevovať.\r\nJedného dňa prídu a na latríne je rozbité okno. Zvolajú lesnú radu a dohadujú sa, kto to mohol urobiť. Vtom sa prihlási malý zajačik:\r\n"Viete, ja som bol práve na rade, keď medveďovi došiel toaletný papier. Tak ma zdrapil, použil a vyhodil cez okno." \r\nVšetci zajačika šutovali a dohodli sa, že okno svojpomocne opravia. O týždeň však bolo okno zase roztrepané. Zavolali zajaca a ten im potvrdil, že sa stalo to isté, ako minule. Tak zase okno opravili, ale keď na druhý deň prišli, našli miesto latríny len kopu rozlámaných dosiek. Zavolali zajaca a spýtali sa ho, čo tentotkrát s ním medveď stváral. Zajac sa zatváril prekvapene a povedal:\r\n"Ja? Ja som v tom tentoraz nevinne. Predbehol ma totiž jež."', 1001, 3.06, 56),
	(12914, 'Príde slimačie dieťa za mamičkou a pýta sa:\r\n- Môžem prejsť na druhú stranu cesty? \r\n- Nie, lebo o 5 hodín pôjde tadiaľ bicykel.', 140, 3.08, 56),
	(12915, 'Leží ježko na ježkovi. \r\n- Miláčik, nepichám ťa?\r\n- Nekecaj a pichaj.', 77, 3.04, 56),
	(12916, 'Veverička sa pýta veveričky:\r\n- Hádaj čo mám?\r\n- Hmmmmm oriešok?\r\n- Nie, besnotu.', 88, 3.66, 56),
	(12917, 'Dvě mouchy seděj na hovně a ta jedna si krkne..\r\nDruhá říká: "Fuj při obědě."', 87, 3.37, 56),
	(12918, 'Jeden Európan vyrastal v Indii, pretože jeho rodičia tam boli pracovne vyslaní. Raz, keď len tak išiel po ceste, stretol malého sloníka, ktorý mal tŕň v nohe. Uľútostilo sa mu ho a tak mu ten tŕň z nohy vytiahol! Roky na to, keď už malý Európan býval zasa v Európe a už bol dospelý, prišiel z Indie veľký cirkus. Európan sa tam išiel pozrieť. Sedel v prvom rade, keď tu zbadal slona, ktorý sa podobal na to malé sloníča kedysi v Indii. Slon si ho tiež všimol, podišiel k nemu, objal ho chobotom a zdvihol do výšky. A potom toho Európana tresol o zem a zadupal. Takže to bol asi iný sloník...', 634, 3.1, 56),
	(12919, 'Čo vznikne keď skrížime žirafu s krtkom?\r\nPredsa ropná veža.', 67, 3.34, 56),
	(12920, 'Miluje sa sviňa s kozou.\r\nKoza: "Neeeeeneeee"\r\nSviňa: "Ale no,no,no"', 70, 3.13, 56),
	(12921, 'Jedna krava sa pýta druhej:\r\n- Nebojíš sa choroby šialených kráv?\r\n- Hihihihihihihi....NIE......lebo ja som lienka.', 121, 3.48, 56),
	(12922, 'Medveď ho má polmetrového, ale chce mať menšieho. Tak ide za lesným šamanom zajacom a pýta sa ho čo má robiť. \r\n"Choď za líškou a spýtaj sa jej, či ti dá. Vždy, keď povie nie, skráti sa ti o 10 centi."\r\nMedveď ho poslúchne a ide za líškou.\r\n"Líška, dáš mi?"\r\n"Nie a choď preč."\r\nUž ho má 40 centimetrového, ale chce ho maľ ešte kratšieho. Ide zas za líškou:\r\n"Líška, dáš mi?"\r\n"Nie. Už som ti to povedala."\r\nUž ho má 30 centimetrového, ale hovorí si:\r\n"Takých 20 centi, to je taký mužšký idol." \r\nTak ide za líškou:\r\n"Líška, dáš mi?"\r\n"Veď už som ti povedala, že nie nie a just nie!"', 644, 3.4, 56),
	(12923, 'Ide zajac po lese na novej kolobežke, stretne ho vlk a pýta sa ho:\r\n"Hej zajac,odkiaľ máš novú kolobežku?"\r\n"Kto neprepije,ten má."\r\nO mesiac stretne vlk zajaca na novom aute a nasraný sa ho pýta:\r\n"Odkiaľ to máš?"\r\n"Kto neprepije,ten má."\r\nO necelý mesiac ide zajac na svojom už starom aute a ponad hlavu mu\r\npreletí vlk na novom vrtuľniku a pristane tesne pred zajacom. Zajac úžasom na chvíľu onemel a nakoniec sa pýta vlka:\r\n"Hej vlk odkiaľ máš nový vrtuľník?"\r\n"Bol som vrátiť fľaše."', 521, 3.72, 56),
	(12924, 'Idú dva napité hady z krčmy a jeden sa pýta druhého:\r\n- Počúvaj, sme jedovaté hady?\r\n- Asi áno a prečo?\r\n- Lebo som si zahryzol do jazyka.', 148, 3.17, 56),
	(12925, 'Vídu dve blchy z baru a jedna hovorí druhej.\r\n"Ideme domov pešo, alebo počkáme na psa?"', 92, 3.4, 56),
	(12926, '- Pane, VY ste sviňa!\r\n- Kroooch.', 34, 2.87, 56),
	(12927, '- Mami, naozaj som ľadový medveď?\r\n- Áno synček, prečo sa pýtaš?\r\n- Lebo je mi kosa!', 92, 3.04, 56),
	(12928, 'Medveď sa odobral na zimný spánok a poprosil zajaca a ježka, aby mu postrážili vrecúško čaju. Keď medveď zaspal, strážcom bolo zima a tak si navarili čajíku... navarili... až všetok čaj minuli. Tu začal ježko bedákať:\r\n- Ajajaj, čo len teraz povieme medveďovi?\r\n- Neboj sa ty nič! - vraví mu zajac - Ty len dobre vyvaľ oči a ja mu všetko vysvetlím.\r\nKeď sa medveď zobudil pýta sa:\r\n- Kde je môj čaj?\r\n- Hej, pichliač! - skríkne na to zajac - Čo teraz strachom vyvaľuješ očiská? Macko sa ťa pýta, kde je čaj!', 552, 3.26, 56),
	(12929, 'Vieš koľko rokov sa dožíva hroch?\r\nNo predsa toľko, koľko má času.', 74, 2.78, 56),
	(12930, 'Zvieratká v lese sa rozhodli, že si urobia párty. Prišli všetci okrem stonožky. Konečne prišla stonožka a hovorí:\r\n- Prečo ste pred dvere dali nápis "Poriadne si vyčistite obuv!"?', 192, 3.2, 56),
	(12931, 'Príde zajac do obchodu a pýta sa \r\n- Máte tonu hrášku?\r\n- Nie. - odpovie predavač.\r\nPríde na druhý deň a znova \r\n- Máte tonu hrášku?\r\nNervózny predavač \r\n- NIE!\r\nPríde na tretí deň a pýta sa\r\n- Máte tonu hrášku?\r\nPredavač šťastne odpovie \r\n- Áno.\r\nA zajac nato:\r\n- To je ale guličiek, čo?', 315, 3.11, 56),
	(12932, 'Hovorí slon mravcovi:\r\n- Nemotaj sa mi pod nohami, lebo keď ťa pristúpim, tak z teba ostane len mastný fľak.\r\n- No, no, no, to sa ti hovorí, keď som po operácii!', 170, 3.06, 56),
	(12933, 'Pláva žaba v jazere a zrazu zbadá zajka na brehu ako húli trávu. Dopláva ku nemu a hovorí:\r\n- Počuj zajac daj šluka.\r\n- A už si niekedy húlila?\r\n- Nie.\r\n- Tak si zapamätaj, hneď ako si potiahneš tak zadrž dych, ponor sa pod vodu, doplávaj na druhý koniec jazera a tm vydýchni. Jasne?\r\nŽaba si šlukla, ponorila sa pod vodu doplávala na druhú stranu a tam vydýchla ale nič necítila, tak začala nadávať. Išiel akurát okolo hroch a videl žabu a opýtal sa jej:\r\n- Čo sa robí?\r\n- Ale, zajac húli na druhom brehu trávu a pekne má dobehol.\r\n- Myslíš že dá aj mne?\r\n- Choď sa ho opýtať.\r\nHroch dopláva ku zajacovi a vynorí sa pred ním načo zajac vytreští oči a zreve:\r\n- Žaba, ty krava, povedal som vydýchnuť!', 754, 3.73, 56),
	(12934, 'Viete, čo je maximálna presnosť?\r\nChytiť mravca za gule boxérskymi rukavicami.', 83, 3.54, 56),
	(12935, 'Varila myšička kašičku, v maľovanom hrnčíčku.\r\nTomu dala, tomu dala, tomu dala a jedného dňa sa z myšky prostitútka stala!', 134, 3.67, 56),
	(12936, 'Viete, ktoré zviera je najrýchlejšie?\r\nGepard.\r\nA ktorý vták je najrýchlejší?\r\nGepardov vták.', 102, 3.37, 56),
	(12937, 'Príde zajko do obchodu a pýta si zmrzlinu.\r\n"Máte mrkvovú zmrzlinu?"\r\n"Nie nemáme."\r\nZajko príde na druhý deň a znova sa pýta.\r\n"Máte mrkvovú zmrzlinu?."\r\n"Nie nemáme."\r\nZajko príde na tretí deň a opýta sa.\r\n"Máte mrkvovú zmrzlinu?"\r\nA predavač na to:\r\n"Ano zajko máme!"\r\n"Tá je ale hnusná, čo?"', 318, 3.06, 56),
	(12938, 'Stretnú sa dva zajace.Jeden z nich krýva.A toto je ich rozhovor:\r\n"Poľovník,poľovník?"\r\n"Áno,áno. "\r\n"Postrelil,postrelil?"\r\n"Nie,zašľapol."', 150, 3, 56),
	(12939, 'Stretnú sa na ulici dvaja chlapi, jeden s pudlíkom a druhý s pitbulom.Pitbul vrčí na pudlíka, chlap ho pustí. Druhý tiež pustí pudlíka.Pudlík roztrhá pitbula a prvý chlap sa pýta druhého:\r\n"Koľko si dal za toho psa?"\r\n"100.000"\r\n"Sto tisíc za psa?"\r\n"50.000 za krokodíla a 50.000 za plastiku."', 312, 3.43, 56),
	(12940, 'V lese sa koná maškarný  ples.Lienka behá po byte a rozmýšľa, za akú masku sa prezlečie. Vojde do kuchyne a napchá sa tvarohom.Na vyhodnocovaní  masiek príde líška k lienke a pýta sa jej:\r\n"A  ty si aká maska?"\r\nLienka  sa plesne po lícach , vyprskne  tvaroh a povie:\r\n"Ja som vyrážka."', 305, 3.49, 56),
	(12941, 'Stoja dve dogy na ulici. Okolo ide jazvečík. Jedna sa dá na útek. Druhá ju po čase dobehne a pýta sa: \r\n- Čo ti šibe? Snáď sa ho nebojíš!?\r\n- Ale čoby. Len on má taky studený nos, že som minule dostala zápal vaječníkov. ', 240, 3.39, 56),
	(12942, 'Idú dva ľadové medvede po púšti a jeden hovorí:\r\n- Tu sa to ale muselo šmýkať.\r\n- Prečo? - pýta sa druhý.\r\n- Keď je to tu tak posypané.', 149, 3.28, 56),
	(12943, 'Po lese chodí strašne naštvaný maco. Všade naokolo sneh, mrzne až praská. Medveď tu kopne do jedličky, tam do zajaca, vlkovi hubu rozbije a pritom si mrmle:\r\n- No na kieho boha som ja v septembri tu kávu pil!?', 219, 3.85, 56),
	(12944, 'Búcha vlk kozliatkam na dvere.\r\n"Kozliatka, kozliatka otvorte to som ja Vaša mamička."\r\n"Ty debil, my sme siroty!"', 117, 3.42, 56),
	(12945, 'Je tuhá zima. Malý slimák sa snaží nájsť miesto na prezimovanie. Pomaly sa doplazí k medvediemu brlohu a zabúcha na dvere. Medveď ich otvorí a dlho nomôže nájsť toho, kto vlastne klopal. Keď zbadá slimáka opýta sa ho:\r\n- Čo je, čo chceš?\r\n- Chcel by som u teba prezimovať. Ja sa strčím len tak do rohu a ty o ma ani nebudeš vedieť.\r\nVtom sa medveď zohne, dá mu malú frčku do nosa a odíde si spokojne ľahnúť spať. Keď sa na jar zobúdza, opäť niekto klope na dvere. Medveď ich otvorí. Tam stojí slimák celý zadýchaný, spotený a hovorí:\r\n- A to malo čo znamenať, há?', 615, 3.8, 56),
	(12946, 'Rodinka ľadových medveďov je na prechádzke a malý medvedík sa pýta otca: \r\n"Tato, som ja ľadovy medveď?"\r\n"No isteže, ja som ľadový medveď, mama ľadová medvedica a ty si ľadový medvedík."\r\nAle mladý ide  a stále krúti hlavou.\r\n"Mama, som ja ľadový medveď?"\r\n"Však ti už tatko povedal, ja som ľadová medvedica, ty si ľadový medvedík a oco je ľadový medveď."\r\nNo malý stále krúti hlavou.\r\n"Tak čo toľko krútiš hlavou."\r\n"Lebo mi je zima,nie."', 481, 2.99, 56),
	(12947, 'Vyškriabe sa slimák po 14 hodinách na strom, spadne a povie si: \r\n"Práca chvatná, málo platná."', 102, 3.34, 56),
	(12948, 'Ježko papká jabĺčko a príde k nemu bocian. Chce byt vtipný tak povie ježkovi:\r\n- Čau jež čo ješ?\r\nJežko na to:\r\n- Čau bocian čo bocian?', 149, 3.25, 56),
	(12949, 'Aký je rozdiel medzi pudlíkom a pittbulom odbavujúcim sa na vašej nohe?\r\nPittbula to necháte dokončiť.', 109, 3.36, 56),
	(12950, 'Letí netopier a po chvíli narazí do skaly: \r\n- Doparoma kvôli tomu walkmenu sa raz zabijem. ', 96, 3.12, 56),
	(12951, 'Príde prasiatko pred zástrčku: \r\n- A teba sem kto zamuroval?', 63, 3.2, 56),
	(12952, 'Prečo kohút kikiríka tak zavčasu ráno?\r\nLebo keď sa zobudia sliepky, už musí držať zobák!', 100, 3.33, 56),
	(12953, 'U veterinára se zídu tri psi: bernardín, vlčiak a pudlík. Začnú si hovoriť svoje životné príbehy.\r\nBernardín začne: \r\n- Robil som u horskej služby. Nosil som na krku súdok rumu a zachraňoval ľudí. Raz som sa ale neudržal a vypil som zo súdku všetok rum. No a teraz som tu na utratenie.\r\nVlčiak pokračuje: \r\n- Ja som robil slepeckého psa. Raz som prevádzal pána cez ulicu a uvidel som krásnu fenku. Neudržal som sa, rozbehol sa za ňou a pána prešlo auto. No a teraz som tu na utratenie.\r\nA nakoniec hovorí svoj príbeh pudlík: \r\n- To ja som si takto behal po byte, vletím do kúpelne a moja krásna panička akurát vyliezala z vane. A ja som se tiež neudržal.\r\nA vlčiak s bernardínom doplnili: \r\n- Takže s nami na utratenie! \r\n- Nie! Ostrihať pazúriky.', 793, 2.95, 56),
	(12954, 'Pred bufetom je obrovský rad. Zajko sa stále predbieha a medveď ho vždy odhodí. Raz ho odhodí až do kríkov.\r\nZajko si vzdychne:\r\n- Ja ten bufet asi neotvorím.', 167, 3.56, 56),
	(12955, 'Medveď ako kráľ lesa vydá zákaz robenia potreby len tak, lebo všade sa povaľuje plno hovien, a dá postaviť záchody. Na druhý deň ide zajac po lese a treba mu srať. Príde ku záchodom, ale všetky sú obsadené. Čo teraz ? Zajac to nevydrží a vyserie sa rovno na lesnú cestičku. Ako doserie tak zbadá medveďa ako sa k nemu blíži. Tak rýchlo prikryje rukami svoju kôpku sračiek. Medveď príde k nemu a pýta sa ho:\r\n"Zajac čo to tam skrývaš ?"\r\n"Aaaaaaale, chytil som motýľa ."\r\n"Tak mi ho ukáž !"\r\nZajac roztvorí ruky a hovorí:\r\n"Jeeeeeeej, asi sa posral ."', 592, 3.56, 56),
	(12956, 'Pasu sa dve kravy na lúke a v tom sa jedna z nich ozve: \r\n- Buuuuuuu.\r\nDruhá sa otočí a povie: \r\n- Práve som to chcela povedať.', 133, 3.03, 56),
	(12957, 'Zajac sedí na brehu jazera. Príde k nemu žaba a pýta sa:\r\n- Kto si?\r\n- Šiahni si.\r\n- Chlpatý, veľké uši. Ty si zajac.\r\n- Výborne. A kto si ty?\r\n- Šiahni si.\r\n- Žiadne chlpy, žiadne uši. Ty si Niki Lauda.', 217, 3.1, 56),
	(12958, 'Ide v zime medveď po lese. Tu kopne do zajaca a tam do stromu. Celý nahnevaný si frfle: \r\n- Do kelu, prečo som si dal koncom novembra tú zalievanú kávu.', 159, 2.87, 56),
	(12959, 'Dva barany sa dívajú ako strihači strihajú jednu ovcu. Starší povie druhému:\r\n- Pozeraj kamoško, teraz uvidíš poriadny striptíz.', 139, 3.01, 56),
	(12960, 'Fero sa rúti vysokou rýchlosťou na svojej motorke. Zrazu oproti nemu letí vrabec. Fero dupol na brzdu, ale neskoro - zrazil malého vrabčeka. Uľútostilo sa Ferovi malého raneného vtáčika, tak zastavil, vyhľadal ho a zobral domov. Doma ho nežne položil do klietky, pripravil misku s vodou, nadrobil kôrku z chleba...\r\nČasom sa vrabčiak prebral. Pozerá okolo seba a vidí mreže, chlieb, vodu... Hovorí si vrabčím hlasom:\r\n- Sakra, ja som toho motocyklistu asi zabil, keď má zavreli.', 504, 3.34, 56),
	(12961, 'Sedia dve sovy vedľa seba. Jedna z nich spraví HUUUUUUUU.\r\nDruhá:"hiiiiiiiiii , ale som sa ta zľakla."', 106, 3.15, 56),
	(12962, 'Ide mravec po lese a zo všetkých síl vlečie dva krajce chleba. Stretne slona. Položí jeden krajec na zem a reve z celých síl:\r\n- Slon! Slon! Rýchlo si tu  ľahni! Rýchlo!\r\nZmätený slon sa asi vyľakal a tak buch na zem. Mravec vyliezol na slona. Vyvliekol so sebou aj ten druhý krajec, položil ho slonovi na hlavu, utrel si pot z čela a spokojne hovorí:\r\n- Bohovsky sendvič sa mi podaril!', 405, 3.58, 56),
	(12963, 'Sedia dva holuby na streche nového vyumývaného BMW-čka a jeden hovorí:\r\n- Ty, ozaj, všímaš si, na akom parádnom aute to sedíme?\r\nA druhý nato:\r\n- Ale čo ma je po tom, seriem ti na to.', 195, 2.91, 56),
	(12964, 'Kvôli extrémnemu suchu na Floride vydali nasledovné oznámenie:\r\nFloridský úrad pre ochranu prírody radí turistom, lovcom a rybárom, aby dbali na zvýšenú opatrnosť a boli v strehu pred aligátormi. Pre vyplašenie aligátora je vhodné nosiť na odeve doplnky spôsobujúce hluk napr. malé zvončeky. Pre prípad stretnutia s aligátorom je dobré mať pri sebe cesnakový sprej. Doporučuje sa tiež sledovať niektoré stopy aligátorovej prítomnosti. Podľa veľkosti a množstva trusu sa dá rozoznať veľkosť a vek aligátora. Trus mladého aligátora je z menších kusov a obsahuje rybie kosti, či vtáčie perie.  Trus dospelého aligátora je z väčších kusov, často obsahuje malé zvončeky a páchne po cesnaku.', 743, 3.09, 56),
	(12965, 'Idú tri korytnačky po púšti, sú strašidelne smädné, idú rok, dva. Po 5 rokoch vidia v diaľke pohár. Prídu celé natešené k poháru, tešia sa, že sa napijú, ale pohár je prázdny. Nechajú pohár tak, a vydajú sa na ďalšiu púť za vodou.Po ďalších 5 rokoch prídu do oázy, chcú sa napiť, ale nemajú pohárik. Premýšľajú, čo s tým urobia, až jednu z nich napadne.\r\n"Jedna z nás sa vráti po pohárik."\r\nVyberú jednu z nich, a korytnačka vraví:\r\n"Dobre, ja pojdem, ale vy mi musíte sľúbiť, že sa nenapijete, kým budem preč."\r\nKorytnačky súhlasili a dohodli sa, že počkajú.Čakajú 5 rokov a hovoria si:\r\n"No, už by mohla byť pri pohári a pomaly by mohla ísť späť."\r\nPo ďalších 5 rokoch si hovoria:\r\n"No, už by tu mohla byť, ale počkáme ešte chvíľku."\r\nPočkajú teda ešte dva roky, ale potom je už ten smäd taký neznesiteľný, že si hovoria:\r\n"Napime sa, veď ona to aj tak nezistí, a ak sa nenapijeme, zahynieme, ako možno zahynula aj naša kamarátka."\r\nPrídu k pramienku, chcú sa napiť, keď sa z krovia ozve hlas tretej korytnačky:\r\n"Vááážené! Pokiaľ si nebudeme dôverovať, ja po ten pohárik nepôjdem."', 1194, 3.81, 56),
	(12966, 'Prečo slimák nebeží?\r\nNemá rád, keď sa mu vejú oči.', 60, 3.32, 56),
	(12967, 'Visia traja netopieri dolu hlavou na konári a zrazu sa jeden z nich postaví. Druhí dvaja sa ho pýtaju:\r\n- A ty si odpadol?', 126, 3.23, 56),
	(12968, 'Jedného krásnaho slnečného dňa lezie na strom korytnačka.Trvá jej to asi tak hodinu.Keď je už hore, odrazí sa a začne mávať ručičkami.\r\nPo dopade na zem sa opráši a ide to skúsiť znovu.Druhý-krát jej to trvá už asi tak 2 hodiny.Vylezie na ten istý konár stromu a odrazí sa.\r\nZákon gravitačnej sily sa opakuje a pancier to zasa vzdržal.Teraz ju to však poriadne nasere.Tretí-krát sa výstup na strom predĺžil na 3 hodiny (však už si dosť ublížila).So silami, ktoré jej ešte ostali, sa teraz poriadne odrazí a začne mávať ručičkami aj nožičkami.\r\nTvrdý náraz sa opäť zopakuje.Na vedľajšom strome sedia dve vrany a tá jedna hovorí tej druhej:\r\n"Miláčik,predsa sme jej len mali povedať, že je adoptovaná."', 763, 3.1, 56),
	(12969, 'Príde sliepka do obchodu:\r\n"Máte televízor?"\r\n"Máme, ale len čiernobiely."\r\n"To nevadí, hlavne nech zrní."', 113, 3.13, 56),
	(12970, 'Ide psíček a zrazu vidí prasiatko, ktoré strašne plače. Psíček sa spýta:\r\n- Prasiatko prečo plačeš?\r\nA prasiatko odvetí:\r\n- Lebo moja mamička je sviňka!', 167, 3.03, 56),
	(12971, 'Prečo má brav smutné oči?\r\nLebo má ženu sviňu a deti prasatá.', 69, 3.15, 56),
	(12972, 'Je to zelené a šteká to. Čo je to?\r\nRosnička vo fľaši s vodkou.', 70, 2.79, 56),
	(12973, 'Pýta sa ježko zajaca:\r\n- Prečo máš také krátke uši?\r\n- Lebo som romantický - odpovedá zajac.\r\n- A to s tým ako súvisí?\r\n- Ale vieš, tak som sa započúval do spevu slávika, že som nepočul kosačku.', 214, 3.21, 56),
	(12974, 'Africká savana, 50 stupňov v tieni, zvieratá sú zmorené horúčavou, slnko neznesiteľne páli, iba žirafa sa usmieva, odhryzuje z nanuku a vraví:\r\n- Je to fakt úžasný pocit, keď v takejto páľave máte nanuk. Je to perfektné ako mi tá zmrzlina pomaličky steká dole tým 5 metrovým krkom...\r\nZajac zdvihne hlavu, červenými suchými očami sa na ňu pozria a hovorí:\r\n- Žirafa, a zvracala si už niekedy?', 424, 3.25, 56),
	(12975, 'Ide zajko po lese a vykrikuje:\r\n" Vlk je buzerant, vlk je buzerant!"\r\nStretne ho líška a hovorí mu:\r\n" Tak neslušne rozprávaš a ešte ti mlieko po  brade tečie!"\r\nZajo na to:\r\n" Vlk je buzerant, vlk je buzerant!"', 219, 3, 56),
	(12976, 'Vrabčiačka vraví susede:\r\n- Rozvádzam sa! Muž si našiel kočku.', 69, 3.02, 56),
	(12977, 'Mravec ide po železničnej trati a spieva si: \r\n\'Život je krásny, tr-tr, život je krásny, tr-tr, život je krásny, tr-tr-tr-tr-tr-tr...', 141, 2.93, 56),
	(12978, 'Tri netopiere sa hádajú, ktorý z nich je najväčší macher a zdolá čo najväčšiu korisť. Tak ide prvý, ktorý sa vráti po pol hodine so zakrvavenými ústami a hovorí:\r\n"Vidíte tam toho býka? Toho som celého vysal."\r\nPotom sa vyberie i druhý, ktorý sa vráti po hodine  so zakrvavenou hlavou a hovorí:\r\n"Vidíte tam tú maštaľ? Všetky kravy som tam vycical." \r\nNuž vyberie sa už úplne beznádejne i tretí,ktorý sa vráti po troch hodinách celý krvavý padne na zem a hovorí:\r\n"Vidíte tam ten stožiar? Ja som ho nevidel!"', 552, 3.04, 56),
	(12979, 'Vykračuje si zajac po lese a vykrikuje: \r\n- Ja som silák, ja som silák. \r\nZrazu za ním vybehne medveď, kopne ho do zadku, zajac preletí 50 metrov, dopadne na zem a kričí: \r\n- Ja som silák, a aký ľahký... ', 216, 2.94, 56),
	(12980, 'Ide nervózne prasiatko po lese a zrazu sa stretne s čarovnou vílou a tá mu vraví:\r\n"Ahoj nervózne prasiatko, splním ti tri želania."\r\n"Ja chcem iba jedno, ja chcem iba jedno!"\r\n"A čo by to malo byť?"\r\n"Zdochni, zdochni!"', 230, 2.98, 56),
	(12981, 'Ide medveď opitý po lese, prepadne ho zajac, dobije a utečie preč. Na druhý deň sa ide medveď sťažovať levovi. Lev zvolá všetky zvieratká a  hovorí:\r\n- Povedz medveď kto ťa zbil?\r\nMedveď na to:\r\n- No bol malý a mal niečo dlhé na hlave.\r\nZajac sa prikloní ku slimákovi a hovorí:\r\n- Prihára ti, však?', 323, 3.39, 56),
	(12982, 'Opitý havran vyjde z baru a chce odletieť.Otrepe sa,ale nevládze  vzlietnuť. O chvíľu to skúsi znova s rovnakým výsledkom. Po viacerých neúspešných pokusoch si zamrmle popod  nos:\r\n"Hm, kašlem na to, pôjdem peši."', 229, 2.83, 56),
	(12983, 'Prečo pri súloži slonica gúľa očami ako benzínová pumpa?\r\nPočíta litre.', 81, 3.31, 56),
	(12984, 'Príde malý slimák ku veľkému a hovorí.\r\n- Počúvaj, nikdy neviem, ako mám prechádzať cez cestu.\r\nVeľký slimák sa zamyslí a povie.\r\n- Nóóóó. Keď uvidíš dve svetlá, postav sa do stredu, to bude auto. Keď uvidíš jedno svetlo, postav sa buď na ľavú, alebo na pravú stranu, to bude bycikel. Dobre? \r\n- Ach áno, rozumiem.\r\nTak už malý slimák ide cez cestu a uvidí dve svetlá. Postaví sa do stredu a čaká. O chvíľu počuje veľký slimák \'CHRST\' a vraví si:\r\n- Hmm, parný valec tadiaľto už dávno nešiel!', 543, 2.98, 56),
	(12985, 'Išiel pes po púšti a hovorí:\r\nKeď nenájdem strom, tak sa poštím.', 72, 3.02, 56),
	(12986, 'Ide zajac okolo potoka a stretne dve vydry.\r\n"Čau TYDRY"\r\nOny sa rozčertia.\r\n"A aké sme Ti my tydri há.My sme predsa vydri!"\r\n"Ále choďťe do kelu,koho raz vydriem tomu tykám."', 183, 2.97, 56),
	(12987, 'Letí orol a cíti, že mu niekto sadol na chrbát. Obzrie sa a vidí, že je to malý vrabec. No dobre, myslí si orol, možno je unavený. Za pár minút pozerá a vidí, ako si vrabec vytiahol vodku, zapálil si cigaretu a pozerá si pornograficky časopis. Orol prekvapene pozerá na\r\nvrabca a vrabec mu hovorí:\r\n- Čo čumíš ty osol, sleduj cestu!', 355, 3.04, 56),
	(12988, 'Krtko v zemi hľadal mušky, ale míny boli všade, \r\nkrtko hrýzol do rozbušky a už lietal po záhrade.', 106, 2.68, 56),
	(12989, 'Mravec: - Sloník, prosím poď von z vody.\r\nSlon nič nehovorí.\r\nMravec: - Slon, poď von z vody!\r\nSlon nič nehovorí.\r\nMravec: - Slon, ihneď poď von z vody.\r\nSlon nahnevane vyjde z vody a podráždene sa pýta mravca: - Čo odo mňa chceš?\r\nMravec: - Už nič, len som sa chcel presvedčiť, že či nemáš moje plavky.', 327, 3, 56),
	(12990, 'Jde takhle chlápek na vesnici ráno do práce. Vyleze před dveře a na chodníku vidí šneka. Má děsně blbou náladu, tak toho šneka sebere, napřáhne se a mrskne s ním do pole. O pár měsíců později někdo klepe, tak jde chlápek otevřít. Na prahu stojí šnek, bojovně cuká tykadlama a říká:\r\n"Ty hajzl, co tohle jako mělo bejt?!"', 353, 3.05, 56),
	(12991, 'Ide zajac po lese a zrazu spadne do jamy. Povie si:\r\n"Trochu počkám, možno ma niekto vytiahne."\r\nO chvíľu spadne ku nemu líška a povie si:\r\n"Jesť mám čo, trochu počkám možno ma niekto vytiahne."\r\nZa chvíľu spadne vlk a hovorí si:\r\n"Jesť mám čo, pomilovať mám čo, trochu počkám, možno ma niekto vytiahne."\r\nO chvíľu spadne medveď a povie:\r\n"Jesť mám čo, pomilovať mám čo, a ešte aj na hubu tu niekto dostane!"', 443, 3.25, 56),
	(12992, 'Čo treba urobiť, keď v lese stretneš medveďa?\r\nNič! Medveď urobí všetko podstatné.', 92, 3.51, 56),
	(12993, 'Hrajú sa slon a blcha na schovávačku. Blcha sa schovala slonovi do zadku. Slon má velké problémy s nájdením blchy a hovorí:\r\n"Kde do riti sa tá blcha schovala."\r\nBlcha vylezie a hovorí:\r\n"Neplatí ty si sa pozeral!"', 226, 3.07, 56),
	(12994, 'Ako najviac opiješ slimáka?\r\nTak, že netrafí domov.', 55, 2.97, 56),
	(12995, 'Jedného dňa stretne vlk policajného psa a hovorí mu:\r\n"Poď so mnou, chytíme si nejakú ovcu a nažerieme sa."\r\nPes súhlasí. Prídu k ohrade, chytia si ovcu a nažerú sa ako sa patrí. Po hostine utekajú do lesa. Ako sa tak blížia k lesu, zrazu sa obaja chytia do pascí. Vlk nelení, odhryzne si nohu a uteká ďalej. Po niekoľkých metroch si všimne, že policajný pes zostáva na mieste a nehýbe sa.\r\n"Musíš si odhryznúť nohu, Ty chumaj."\r\n"A čo si myslíš, že robím. Už som si odhryzol tri a stále ma to drží!"', 541, 3.08, 56),
	(12996, 'Stretnú sa dve korytnačky a jedna z nich nemá pancier. Tá druhá sa jej pýta:\r\n- A tebe sa čo stalo?\r\n- Ále, ušla som z domu!', 133, 3.13, 56),
	(12997, 'Malý zajačik stojí pred zrkadlom.\r\nMamka sa pýta: \r\n- Vyrážky?\r\n- Nie, broky.', 83, 3.14, 56),
	(12998, 'Ide zajac po lese. V ruke sódovka.Naraz si sadne na pníček.\r\nVzdychne si a dobre si vyhoní. Potom vypije sódovku a tresne sa prázdnou fľaškou po hlave.\r\nPreberie sa o dve hodiny a hovorí:\r\n" ŽENY, CHĽAST A DROGY TO JE MOJE."', 235, 2.86, 56),
	(12999, 'Ide matka koza do obchodu a vraví svojím kozliatkam.\r\n" Detičky pekne sa doma hrajte a keď odídem zamknite sa , a keď prídem tak mi na heslo otvoríte. To heslo bude vylížte mi kozy". Avšak vlk stál za rohom a všetko počul.Po chvíli vlk klope na dvere.\r\n" Kozičky , kozičky otvorte vrátka, ja som vaša mamička, nesiem vám..."\r\nZ vnútra sa ozve:\r\n" Aké je heslo?"\r\n" Vylížte mi kozy."\r\nV tom mladý capko pribehne k dverám a povie:\r\n" A ty mi vylíž vtáka, pretože mi máme kukátko!"', 511, 3.33, 56),
	(13000, 'Príde malý a velký zajac domov a velký zajac je úplne osraný.Mama zajačica sa pýta veľkého zajaca čo sa vlastne stalo.\r\n"Ja som bol za medveďom a tak som ho zbil,že sa až posral."\r\nMalý zajac hovorí:\r\n"Mama never mu medveď si do neho utrel ryť."', 263, 3.2, 56),
	(13001, 'Príde Peter ku zverolekárovi a pýta saho.\r\n- Pán doktor, môžete mi povedať, prečo mi zdochla koza?\r\n- Asi musela niečo zožrať.\r\n- To nie.\r\n- A prečo nie?\r\n- Lebo som jej už mesiac nedal nažrať.', 208, 3.35, 56),
	(13002, 'Aký je rozdiel medzi zajacom, čo uteká a zajacom, čo leti?\r\nNo ten, čo letí, má na chrbáte jastraba.', 108, 2.95, 56),
	(13003, 'Stretnú sa traja upíri a chvália sa. Prvý je do tretiny od krvi a hovorí:\r\n"Vidíte tamtú kravu? "\r\n"Áno"\r\n"No, tak tú som celú vycucal!"\r\nDruhý je do dvoch tretín od krvi a hovorí:\r\n"Vidíte tamtoho slona?"\r\n"Áno"\r\n"No, tak ja som ho celého vycucal!"\r\nTretí je celý od krvi a hovorí:\r\n"Vidíte tamten stĺp?"\r\n"Áno"\r\n"No, tak ja som ho nevidel!"', 364, 3.15, 56),
	(13004, 'Ide mravec po lese a za sebou vlečie dva veľké krajce chleba. Keď stretne slona, jeden krajec chleba položí na zem a zakričí naňho:\r\n- Heeej slon, slon, už aj si tu ľahni!\r\nSlon sa asi zľakol a buch na zem. Mravec vylezie na slona, vyvlečie aj druhý krajec chleba, položí ho slonovi na hlavu, utrie si pot z čela a spokojne povie:\r\n- Bohovský sendvič sa mi podaril!', 384, 3.11, 56),
	(13005, 'Jeden komár hovorí druhému:\r\n- Počuj, ty toho ožrana uštipni a ja budem riadiť.', 86, 2.74, 56),
	(13006, 'Blcha vošla frajersky cez rozlietacie dvere do salónu, vypila tri whiskey a vyskočila von. Zrazu sa postavila, oprášila a povedala:\r\n- OK, kto mi odplašil psa?', 165, 2.68, 56),
	(13007, 'Čo používajú slonice namiesto vibrátora?\r\nMalé epileptické prasiatko.', 76, 3.12, 56),
	(13008, 'Príde domov kliešť a hovorí:\r\n"Ja sa na to môžem vykašľať! Zase ma vytočili!"', 87, 3.03, 56),
	(13009, 'Stretnú sa raz v lese slon a myš a slon hovorí myši:\r\n"Počúvaj myška, nemohla by si pre mna niečo urobiť?"\r\n"Prečo nie."\r\n"Strašne ma svrbí v chobote, čo keby si mi vliezla do chobota a trochu mi tam pobehala. Urobíš mi tým veľké labúžo."\r\nMyš nelenila a vliezla slonovi do chobota. Keď odtiaľ vyliezla slon jej hovorí celý štastný:\r\n"Júúúj to bolo labúžo, urob mi to ešte raz."\r\nMyš vliezla do chobota s tým, že naposledy to ešte pre slona urobí.\r\nNa to slon slastne privrie oči, strčí si chobot do zadku a radostne si zašomre:\r\n"Nekonečné labúžo."', 595, 2.83, 56),
	(13010, 'Príde zajac so zajačicou do cirkusu. Je predstavenie, kde kúzelník vyťahuje z klobúka jedného zajaca za druhým. Po skončení cirkusu hovorí zajačica zajacovi:\r\n"Miláčik, ale náš spôsob je určite príjemnejší!"', 228, 3.03, 56),
	(13011, 'Mamut ide po lese a zrazu počuje buchot. Z ničoho nič sa prirútia dva slony, začnú ho mlátiť a márovať ostošesť. Nakoniec slony zdrhnú.\r\nMamut sa celý dolámaný a krvavý postaví a dokrivká k jazeru, aby sa umyl. Ide okolo medveď a pýta sa:\r\n"Preboha, mamut, čo sa ti stalo?" \r\n"Ále, zasraní skinheadi..."', 327, 2.99, 56),
	(13012, 'Príde zajac do mäsiarstva a pýta sa: \r\n"Máte bravčové?"\r\n"Áno."\r\nV tom zajac vytiahne pištoľ, odstrelí mäsiara a povie:\r\n"To máš za prasiatko."', 156, 3.02, 56),
	(13013, 'Ide zajko po lese a pospevuje si:\r\n- Pretiahol som levicu, pretiahol som levicu...\r\nStretne ho líška:\r\n- Zajko, ako to môžeš takto? Začuje ťa lev a bude zle!\r\n- Ále, to nič...\r\nIde zajko ďalej a spieva si:\r\n- Pretiahol som levicu, pretiahol som levicu...\r\nStretne medveďa:\r\n- Zajko! Neblázni, veď ten ťa roztrhá, keď to začuje!\r\n- Ále, to nič...\r\nIde zajko ďalej, pospevuje si, keď tu stretne leva. Ten ho začne naháňať, zajko vhupne do bútľavého stromu, lev za ním, diera je ale malá, tak sa zasekne. Zajko vylezie z druhej strany stromu:\r\n- A toto mi nikto neuverí!', 598, 3.03, 56),
	(13014, 'Príde cudzinec do krčmy a pred ňou si nechá psa - vlkodava. Po chvíli príde ku cudzincovi iný muž a vraví mu:\r\n- Ten vlkodav pred vchodom je váš?\r\n- Áno je môj. Prečo?\r\n- No, lebo moja čivava ho zabila.\r\n- Ako mohla, prosím vás, malá čivava zabiť vlkodava?\r\n- Zabehla mu v hrdle.', 299, 3.32, 56),
	(13015, 'Zvieratká sa rozhodli otvoriť v lese bar. V deň otvorenia sa pred barom zhromaždia všetky zvieratá. Medzi poslednými prichádza zajac a začne sa predierať dopredu. Keď je vpredu zbadá ho medveď, chytí ho pod krk a hovorí mu:\r\n"Kde sa tlačíš pakuj dozadu."\r\nA šmarí ho na koniec radu. Zajac sa znovu pokúša dostať dopredu.\r\nMedveď ho bací labou a znovu ho šmarí dozadu.\r\nZajo sa opráši a šomre: \r\n"Do kelu, ja ten bar dnes asi neotvorím."', 467, 2.8, 56),
	(13016, 'Mravec je straše zaľúbený do slonice a rozmýšľa čo urobiť. Napadlo mu, že ju urobí zozadu. Vylezie teda na slonicu a strašne ju pomiluje. Slonica mala taký orgazmus, že zdochla. Nato si  mravec povzdychne:\r\n"Dve minúty potešenia a teraz môžem celý život hrob kopať."', 287, 3.11, 56),
	(13017, 'Pýta sa slimák s domčekom iného slimáka bez domčeka.\r\n"Prečo sa tak štastne usmievaš?"\r\n"Lebo som utiekol z domu."', 123, 2.66, 56),
	(13018, 'Stretnú sa dva mravce a jeden z nich je celý zafačovaný. Druhý sa ho pýta:\r\n"Ty kamoš čo sa ti stalo?"\r\n"Ále predstav si, idem večer z krčmy domov a naraz zbadám svätojánsku mušku. Dostal som na ňu chuť, reku zašpásujeme si, hupsnem na ňu - do prdele a to vajgel !!!!"', 288, 3.08, 56),
	(13019, 'Medveď, líška a jazvec hrajú karty. Zrazu medveď vyskočí, hodí karty na stôl a zreve:\r\n"Nebudem nikoho menovať, aby som niekoho neurazil, ale ak ten niekto bude aj naďalej švindlovať, tak mu tú hrdzavú hubu rozbijem!"', 232, 2.99, 56),
	(13020, 'Na dvore sedia dva kohúty a strašne sa nudia. Jeden hovorí tomu druhému: \r\n- Poďme si zakikiríkať! \r\nDruhý na to: \r\n- Mne sa nechce, poďme sa radšej pozrieť do mäsiarne na holé sliepky...', 200, 3.11, 56),
	(13021, 'V rodine dážďoviek:\r\n- Mami, mami, kde je ocko?\r\n- To vieš, chlapi ho zobrali na ryby.', 90, 3.08, 56),
	(13022, 'Kedy má sliepka najviac peria?\r\nKeď má na sebe aj kohúta.', 61, 2.96, 56),
	(13023, 'Malé ťaviatko sa pýta mamy: \r\n"Mami, prečo máme také veľké mihalnice?"\r\n"No, to preto, lebo keby išiel po púšti koník tak by mu do jeho očiek nafúkal piesok, pretože jeho mihalnice sú veľmi malé."\r\n"Aha, a prečo máme také ploské nohy?"\r\n"No, to preto, lebo keby išiel koník po púšti tak by sa mu tie jeho kopýtka zabárali do piesku a ďaleko by nedošiel."\r\n"Aha, a prečo máme také dva hrby na chrbte?"\r\n"No, to preto lebo v nich máme zásobu tuku a vody aby sme neboli hladné a smädné."\r\n"Aha, ale mami nie je nám to na prd, keď sme v zoologickej záhrade?"', 595, 3.1, 56),
	(13024, 'Zajačik sedí na pníku. Nudí sa a obzerá sa. Vtom začuje obrovské PRÁSK a z kríkov vybehne slon a strašne sa smeje. Keď sa trochu ukľudnil, vbehol tam zas a zajačik začul opäť strašnú ranu. Slon vybehol a od smiechu sa šiel popučiť. Po chvíli to zajačika prestalo baviť a opýtal sa slona na čom sa tak strašne dobre baví. A slon mu na to:\r\n"Vieš za kríkmi je stádo paviánov a samičky sa teraz pária. Ja sa tvárim, že som statný samčisko a vždy keď to do nej pustím tak strašne buchne."', 526, 2.75, 56),
	(13025, 'Nahnevané prasiatko sa prechádza pri rybníku. Zrazu sa mu z rybníka ozve zlatá rybka a povie:\r\n- Prasiatko, čo si želáš? Splním ti 3 želania.\r\nPrasiatko povie:\r\n- Skap, skap, skap!', 191, 3.1, 56),
	(13026, '"Prasiatko, prečo plačeš?"\r\n"Lebo moja mama je sviňa."', 58, 3.2, 56),
	(13027, 'Zvieratká v lese poriadajú sex-párty. Každý s každým súloží, a všetci sa dobre bavia. Medveď s líškou zbadajú slona ako sám sedí a má na pindíku prezervatív. Hovoria mu:\r\n"Prečo máš prezervatív, veď toto je neobmedzovaná sex-párty!"\r\n"To nie je prezervatív, dážďovka mi fajčí."', 310, 3.27, 56),
	(13028, 'Prečo nemá kohút ruky?\r\nLebo sliepka nemá prsia.', 52, 2.74, 56),
	(13029, 'Naháňa myšiak myšičku a už sú celí ropálení. Myšiačik by chel, myšička tiež, ale snaží sa zachovať dekórum. Keď to už nemôže vydržať vraví mu:\r\n- Myšiačik, poďme sa zahrať schovávačku, ty budeš žmúriť prvý a ja sa idem schovať. Keby niečo som v druhej zásuvke od spodu v kredenci.', 320, 2.81, 56),
	(13030, 'Vlk hovorí zajkovi:\r\n"Zajko, vyfajči mi ho."\r\n"Ale ja neviem ako sa to robí."\r\n"To nevadí, rob ako vieš."\r\n"Chrum, chrum, chrum."', 134, 3.36, 56),
	(13031, 'Malé moliatko sa vydá na svoj prvý let. Po návrate sa ho rodičia pýtajú ako bolo.\r\n"Bolo to senzačné, hneď ako som vyletel všetci mi začali tlieskať."', 163, 2.9, 56),
	(13032, 'Slon stúpi nohou do mraveniska. Mravce naňho začnú útočiť. Jeden sa mu dostane až na krk a ostatné ho začnú povzbudzovať:\r\n"Hugo, Hugo, zaškrť ho !"', 162, 2.96, 56),
	(13033, 'Líška, zajac a medveď sa dozvedia, že ich chcú odviesť na vojnu. Prvá dostane povolávací rozkaz líška. Hovorí zajacovi a macovi: \r\n- Viete čo? Ja mám dlhý chvost, odseknite mi z neho polovicu a potom ma možno neodvedú. \r\nVečer sa líška vracia a hovorí, že pre krátky chvost ju neodviedli. \r\nNa druhý deň má ísť zajac, tak hovorí: \r\n- Ja mám dlhé uši, tak mi z nich odseknite polovicu.  \r\nVečer sa vracia a hovorí, že pre krátke uši ho neodviedli. Na tretí deň má ísť medveď. \r\n- No čo ja, nemám ani dlhý chvost ani dlhé uši, tak mi vytrhajte všetky zuby a potom ma možno neodvedú.\r\nVečer sa medveď vracia akýsi smutný. Zajac sa pýta:\r\n- Tak čo, ako si dopadol?\r\n- Nevzali ma, lebo som velký a tučný!', 759, 3.42, 56),
	(13034, 'Nezamestnaný muž reaguje na inzerát zoologickej záhrady a príde na pohovor. Tam mu povedia, že im zdochla gorila, na ďalšiu nemajú peniaze, a tak hľadajú niekoho, kto by ju hral. Mužovi sa to zdá divné, ale kedže potrebuje zamestnanie, tak to príjme. Zašijú ho do opičej kože. Zo začiatku si na to musí zvykať, ale časom sa to perfektne naučí. Jedného dňa, keď sa húpe na konári sa pozabudne, rozhojdá sa a spadne do vedľajšej klietky. Keď sa rozhliadne, vidí, ako sa k nemu blíži lev. Keď je už pri ňom s otvorenou papuľou, začne nahlas kričať: \r\n- Pomóóc. \r\nA lev mu vraví: \r\n- Drž hubu, lebo obaja prídeme o prácu.', 668, 3.13, 56),
	(13035, 'Opitá sova letí lesom, zletí na zem a tam leží horeznak pod stromom:\r\n- Kukuk, čvirik, alebo ako to bolo?', 111, 2.86, 56),
	(13036, 'Sedí Jožko smutný na kameni, príde k nemu kamarát a pýta sa ho:\r\n- Jožko, prečo si taký smutný? \r\n- Ale vieš, vyhodili ma z roboty.\r\n- A prečo ťa vyhodili, čo si robil?\r\n- Vraj som veľmi pomalý. Mal som dať korytnačkám žrať, otvorím klietku a fŕŕŕŕnk korytnačky mi ušli. ', 299, 3.02, 56),
	(13037, 'Zajac ide po lese a vykrikuje:\r\n"Vlci sú buzeranti! Vlci sú buzeranti!!\r\nVidí ho líška:\r\n"Zajac, ty si sa asi zbláznil! Počuju to vlci a zjedia ťa, chuďatko malinké, veď máš ešte mlieko na brade."\r\n"To nie je mlieko. Vlci sú buzeranti!"', 251, 3.13, 56),
	(13038, 'Sedia dvaja páni vo vlaku v jednom kupé oproti sebe a každý má svoje kufre oproti sebe, nad spolucestujúcim, aby na ne videl. Z jedného kufra začne niečo kvapkať. Pán čo sedí pod ním nastaví prst, ovonia, znovu nastaví prst, oblíže a vraví:\r\n"Hm slivovica."\r\nMajiteľ kufra mu odpovedá:\r\n"Ále kdeže slivovica, foxteriér!"', 344, 3.05, 56),
	(13039, 'Zajac si dal urobiť nový záchod a chcel,aby ho vyskúšali aj jeho kamaráti. A tak zorganizoval oslavu a pozval na ňu všetky zvieratá. Líška potrebovala na záchod. Zajac sa jej opýtal, akú hudbu jej má pustiť. Odpovedala, že metal. Vyšla zo záchodu a záchod pochválila. Potom išiel vlk. Pýtal si vážnu hudbu. Vyšiel zo záchodu a chválil záchod. Medveď beží na záchod a veľmi sa ponáhľal. Zajac sa ho opýtal, akú hudbu chce. Medveď odpovedal, že to je jedno. Medveď vyjde zo záchodu celý špinavý.\r\n"Medveď ty si čo robil."\r\n"Ty somár, ty si mi pustil hymnu!"', 603, 3.15, 56),
	(13040, 'Visia tri netopiere na bidle, prostredný sa zrazu postaví a jeden visiaci sa pýta druhého visiaceho:\r\n- Počúvaj, nevieš čo sa mu stalo?\r\n- Ále, zase odpadol.', 166, 3.19, 56),
	(13041, 'Príde potkan do obchodu a hovorí: \r\n- Chcem si kúpiť televízor. \r\nPredavač: \r\n- A aký by ste chceli? \r\n- Taký, čo má najviac kanálov.', 144, 3.23, 56),
	(13042, 'Príde anglická kráľovná na návštevu do Kene a tam pre ňu prichystajú obrovský sprievod so zebrami, koňmi a žirafami. Ako tak idú po ulici, zrazu si jeden kôň akurát pred kráľovnú strašne prdne. Delegát sa jej začne horlivo ospravedlňovať a ona len povie:\r\n- To je OK, myslela som, že to bol kôň.', 322, 3.1, 56),
	(13043, 'Sedí zajac na pníku, strašne plače a narieka. Ide okolo medveď a pýta sa ho:\r\n- Zajko, pre pánajána, čo sa ti stalo? Prečo tak plačeš?\r\n- Vieš medveď, líška ma znásilnia na čistinke! \r\n- Hej? A to kedy? \r\n- Predvčerom, včera a aj dnes tam pôjdem.', 267, 2.89, 56),
	(13044, 'Príde zajko pred liščiu noru a vidí ako sa hrajú liščata. Podíde k nore a pýta sa: \r\n- Líštičky, detičky, mamička je doma?\r\n- Nie, išla do kurína pre večeru. \r\n- A otecko tiež nie je doma? \r\n- Nie ten išiel na pivo. \r\n- A takto po papuli nechcete?', 266, 3.14, 56),
	(13045, 'Keď slimák prechádzal cez cestu, zrazila ho korytnačka. Prebral sa v nemocnici a tam sa ho pýtajú, ako sa to stalo.\r\n- Nespomínam si, zomlelo sa to tak rýchlo!', 167, 3.14, 56),
	(13046, 'Príde domov malý dinosaurus a pýta sa. \r\n- Mami? Keď zomrieme, pôjdeme do neba? \r\n- Nie, do múzea.', 104, 3.65, 56),
	(13047, 'Sedí hroch po krk v blate, prdí a pozoruje ako smradľavé bublinky z blata vyskakujú. Pribehne opica a kričí na neho: \r\n- Hej, ty tlsťoch, tu neďaleko v blate uviazol slon. Poď rýchlo, pomôžeme ho vytiahnuť... \r\n- No akurát! - odmieta hroch - Ja teraz všetko nechám a začnem sa chujovinami zaoberať.', 317, 3.2, 56),
	(13049, 'Sedí námorník v bare spolu s papagájom a pred sebou má vodku, chce ísť na záchod a vysvetľuje papagájovi:\r\n"Ak vypiješ tú vodku vytrhám ti všetko perie!"\r\nPo chvíli sa námorník vráti, na stole vidí prázdnu fľašu a pod \r\nstolom papagája ako si trhá perie a pritom kričí:\r\n"Na čo mi je perie!!!"', 320, 3.05, 56),
	(13050, 'Zajac behá po lúke a strašne sa rehoce. Mustang sa ho pýta, prečo sa tak smeje.\r\n"Pobehni si aj ty a uvidíš."\r\nKôň behá celú hodinu a nič. Zajac sa čuduje:\r\n"A teba tá tráva nešteklí na vajciach?"', 213, 3.47, 56),
	(13051, 'Ide rozzúrený vlk po lese, stretne drevorubačov a pýta sa:\r\n- Nevideli ste tu Červenú Čiapočku?\r\n- Myslíš tú s košíkom a koláčikmi?\r\n- Nie, tú s nožíkom a dvoma chlpatými vajciami.', 199, 3.27, 56),
	(13052, 'Potkala žirafa myšku a říká:\r\n"Ty ani nevíš, jaké to je dobré mít takový dlouhý krk."\r\n"Hmmm", myška na to.\r\n"Díky svému krku dosáhnu na ty nejvyšší a nejchutnější lístečky na stromě."\r\n"Hmmm."\r\n"A když je polykám, to tak krásně dlouho trvá, než to projde celým mým krkem."\r\n"Hmmm."\r\n"A když se pak napiju pramenité vody, ona tak krásně dlouho a  dlouho sklouzává do žaludku a celou mně ochlazuje."\r\n"Hmmm," rozpovídá se myška, "a... už jsi někdy zvracela?"', 503, 3.53, 56),
	(13053, 'Raz sa medveď poriadne opil v krčme. Cestou domov ho však niekto poriadne zmlátil. Na druhý deň po vytriezvení zvolal všetky zvieratá lesa a vraví: \r\n- Keď sa mi dostane do rúk ten kto ma včera zbil, tak ho roztrhám na kúsky. Má šťastie, že neviem presne kto to bol, ale to viem, že na hlave mal dve také veľké veci.\r\nNa to zajac: \r\n- No slimák, tuším máš problém!', 393, 3.39, 56),
	(13055, 'Na dvore fajčí kuriatko. Pristihne ho kohút a hovorí mu:\r\n- Nefajči, lebo to poviem tvojej mame!\r\nKuriatko na to:\r\n- Ha ha ha nepovieš, lebo ja som z umelej liahne!', 170, 2.91, 56),
	(13056, 'Prečo majú kačky ploché nohy?\r\nAby mohli zašlapávať lesný požiar.\r\nPrečo majú slony ploché nohy?\r\nAby mohli zašlapávať horiace kačky.', 149, 3.29, 56),
	(13057, 'Čo sa stane s bielou ovcou, keď ju hodíte do Čierneho mora?\r\nBude mokrá.', 77, 3.32, 56),
	(13058, 'Medveď, líška a zajac hrajú karty. Medveď po chvíli povie:\r\n- Niekto tu podvádza, ale ako mu dám po tej rišavej papuli.', 128, 3.06, 56),
	(13059, 'Čo je vrchol sadizmu?\r\nVyľakať pštrosa stojaceho na betóne.', 64, 3.15, 56),
	(13060, 'Vyjde opitá mucha z krčmy.\r\n-Bzz, bzz, bzz... \r\nNič. \r\n- Bzz, Bzz, Bzz...\r\nZasa nič.\r\n- A kašlem na to, idem pešo!', 120, 2.8, 56),
	(13061, '"Haló! To je spolok na ochranu zvierat?"\r\n"Áno, čo si prajete?"\r\n"Rýchlo sem niekoho pošlite! Vo dvore je na strome poštár a strašne nadáva nášmu psovi!"', 164, 3.08, 56),
	(13062, 'Na úrad práce príde hovoriaci zajac. Úradník dlho hľadá, ktoré miesto by sa mu najviac hodilo, nakoniec nájde jedno voľné v cirkuse. Ale zajac hovorí:\r\n"No neviem, čo bude to pravé orechové. Ja som okrem iného dosť dobrý\r\ninštalatér."', 254, 2.86, 56),
	(13063, 'Jazvečík Ferdo sa pozerá z okna na druhom poschodí. Okolo ide boxer Bobo a volá:\r\n- Ferdík, poď dole, prebehneme sa.\r\n- Nemôžem, naši sú preč a je zamknuté.\r\n- No tak skoč!\r\n- To vieš! A budem vyzerať ako ty!', 224, 3.02, 56),
	(13064, 'Zajačik prišiel k medvediemu brlohu:\r\n"Hej, medvieďatá, máte doma mamu?"\r\n"Nie."\r\n"Tak jej povedzte, že mala šťastie. Keby bola doma, tak by som ju pomiloval. Na druhý deň zas:\r\n"Je mater doma?"\r\n"Nie."\r\n"Zase mala šťastie, hneď by som ju pomiloval."\r\nNa tretí deň sa medvedica rozhodla, že si na zajačika počká. Keď sa ozval:\r\n"Hej! Máte doma mater?",\r\ntak roztvorila dvere, ale než ho stihla chytiť, zajačik skočil do lesa. A ona za ním, ale nešťastne sa zasekla medzi dva kmene. Zajačik ju obchádza a hovorí:\r\n"Chápem, že je to neslušné, neestetické až blbé, ale čo už mám robiť, keď som to detičkám sľúbil?"', 658, 2.91, 56),
	(13065, 'V lese otvárajú nový bufet. Prvý je medveď, za ním ostatné zvieratká. V tom sa dopredu predbehne zajac. Medveď ho vysokým oblúkom sotí naspäť. Keď sa to zopakuje asi 3-krát, zajac zo zlomenou nohou a rukou, otrasom mozgu a bez jedného zuba hovorí:\r\n- No nič, bufet otvovím zajtva! ', 301, 3.25, 56),
	(13066, 'Zlodej rabuje cudzí byt, keď zrazu tesne za chrbtom počuje:\r\n"Ježiš ťa vidí!"\r\nCelý vyľakaný sa obzerá, ale nikde nikoho, tak rabuje ďalej. Po chvíli sa zase ozve hlas:\r\n"Ježiš ťa vidí!"\r\nTentokrát sa sústredil lepšie a zistil, že hlas vychádza z klietky s papagájom. Uľahčene mu hovorí:\r\n"Tak to ty vykladáš? A ako ťa volajú?"\r\n"Jeremiáš."\r\n"Ha-ha-ha! Čo to bol za blázon, čo ti dal také meno?"\r\n"Ten istý blázon, čo dal rotvajlerovi meno Ježiš."', 488, 3.44, 56),
	(13067, '"Kde ste boli?"\r\n"S deťmi v ZOO."\r\n"A zvieratká ste videli?"\r\n"Videli. Aj tigra. Prišiel ku klietke a urobil \'P-f-f-f-f..\'."\r\n"Kecáš! Viem predsa, ako robí tiger. Robí v-r-r-r!"\r\n"Aj tak môže. Keď je otočený papuľou."', 230, 3.26, 56),
	(13068, 'V autobuse jednému sediacemu cestujúcemu kvapká na ruku z tasky, ktorú drží iný cestujúci stojaci v chodbičke. Ten sediaci si oblizne ruku a bodro hovorí:\r\n"Kúpili ste si uhorčičky?"\r\n"Nie. Veziem na chatu šteniatko."', 231, 2.82, 56),
	(13069, 'Sedia dve blchy na plešine a jedna sa pýta tej druhej:\r\n- Pamätáš sa? Kedysi sme sa tu hrávali na schovávačku.', 118, 2.83, 56),
	(13070, 'Ide ježko večer po púšti, pritúli sa ku kaktusu a povie:\r\n- Mama, ja sa bojím. ', 85, 2.87, 56),
	(13071, 'Sedí zajko na pníčku a strúha drievko. Ide okolo líška a pýta sa ho\r\n- Zajko, čo robíš?\r\n- Sedím na pníku, strúham drievko a potom ním zabijem medveďa.\r\nO chvíľu ide okolo vlk a pýta sa\r\n- Zajko, čo robíš?\r\n- Sedím na pníku, strúham drievko a potom ním zabijem medveďa.\r\nMedveď sa to dopočul, tak ide za zajkom a pýta sa ho\r\n- Zajac, čo robíš?\r\n- Ále, sedím na pníku, strúham drievko a trepem blbosti.', 437, 3.02, 56),
	(13072, 'Starý kapor poúča svojho syna o sexuálnych veciach, keď sa ho ten zrazu spýta: \r\n- No dobre, otec, ale ako zistím, že je už vlhká?', 140, 2.8, 56),
	(13073, 'Ide zajac po lese, a tu počuje z kríkov nejaký krik. Odhrnie halúzky a vidí ako lišiak šklbe perie zo sliepky a volá:\r\n- Chcem ťa vidieť nahú!', 153, 3.98, 56),
	(13074, 'Leží zajac na pni a pilníkuje si nechty. Ide okolo líška a pýta sa:\r\n"Zajac, čo robíš?" \r\n"Ležím na pni, pilníkujem si nechty a chystám sa zmlátiť medveďa." Potom ide okolo vlk a pýta sa:\r\n"Zajac, čo tu robíš?"\r\n"Ležím na pni, pilníkujem si nechty a chystám sa zmlátiť medveďa."\r\nNakoniec sa to dostane medveďovi do uší, tak sa naštve, príde k pňu, zdrapí zajaca a utre si s ním zadok. Zajac ide domov a vo dverách stojí jeho žena zajačica a deti zajačence. Deti vreštia:\r\n"Otecko, čo sa ti stalo?"\r\n"Ááále, zmlátil som medveďa a on sa chudák z toho posral."', 606, 3.76, 56),
	(13075, 'Poľovník ustrelí zajacovi vajcia, tak zajac príde k doktorovi medveďovi:\r\n"Pán doktor, vajcia mi ustrelili, našite mi nejaké náhradné!"\r\nMedveď pozrie do skladu a nájde vajcia, ale iba z medveďa. Tak ich zajacovi prišije a hovorí:\r\n"Zajac, o týždeň príď na kontrolu!"\r\nZajac príde o týždeň a medveď sa pýta:\r\n"Tak čo zajac, ako vajcia?"\r\n"Dobre, dobre, pán doktor, len v zákrute trochu vynášajú!"', 428, 3.44, 56),
	(13076, 'Po púšti ide chlapík a za sebou ťahá klavír. Zrazu za sebou začuje syčať hada, tak zrýchli krok, no had sa stále viac a viac približuje, tak už začne bežať. Napokon sa už vzdá a na smrť unavený klesne na zem. Zrazu za ním príde had a vraví:\r\n-Sssom ti chcel len pomôcť.', 294, 3.47, 56),
	(13077, 'V malebnej dolinke na Orave sa pasú traja býci (mladý, stredne starý  a starý) a túžobne pozerajú na kravy, ktoré sa pasú na kopci.\r\nMladý býk hovorí: \r\n- Chlapci, rýchlo vybehnime hore, rýchlo ich pototo a rýchlo zbehnime dolu.\r\nStredný býk chovorí: \r\n- Žiadne také, chlapci, pomaly pasúci sa vyjdeme hore, pomaly ich pototo a pasúci sa zídeme dolu.\r\nStarý býk hovorí: \r\n- Nebuďte hlúpi, chlapci, keď kravy niečo chcú, nech zídu dolu.', 468, 3.16, 56),
	(13078, 'Rozhodol sa slimák, že vylezie na strom. Lezie prvý deň, druhý deň. Na tretí deň je už skoro tam, keď zrazu spadne dole a vraví si: Načo som sa, ja somár, tak ponáhľal?', 183, 3.06, 56),
	(13079, 'Ide slon po ceste a pristúpi žabu. Tá vypleští oči a slon jej na to: \r\n- To zízaš, aké mám perfektné botasky.', 120, 3.23, 56),
	(13080, 'Do chovproduktu vrazí rozčúlený muž s ľadovým medveďom na vodítku: \r\n- Kde je ten hajzel?\r\n- Ktorý? - pýta sa predavačka. \r\n- Ten, čo mi pred rokom predával bieleho škrečka!', 189, 3.48, 56),
	(13081, 'Ide zajačik po lese a zbadá jamu, v ktorej je medveď. Vidí, že medveď sa von nedostane a tak si pomyslí.\r\n"Ten medveď ma zbil, tak ja ho oštím."\r\nOští ho, ide preč a vtom si spomenie:\r\n"Ale on ma aj dnes zbil! Ja ho ozvracia!"\r\nOzvracia ho a znova ide preč, keď mu dôjde:\r\n"Ale on ma stále bije. Vždy, keď ma stretne. Ja sa vrátim a oseriem ho!"\r\nTak aj urobí, ale ako tak čupí nad jamou, spadne dolu k medveďovi. Otočí sa na medveďa a hovorí mu:\r\n- Asi mi neuveríš, ale prišiel som sa ti ospravedlniť.', 534, 3.59, 56),
	(13082, 'Lev rozdeľuje zvieratá na pekné a inteligentné. Príde na rad žaba a hovorí:\r\n- A ja čo sa mám rozpoliť?', 113, 3.09, 56),
	(13083, 'Ide medveď po lese a stretne zajaca. Zajac sa pýta: \r\n- Kam ideš medveď?\r\n- Nakupovať do Rakúska.\r\nZajac nato: \r\n- Išiel by som s tebou, ale nemám pas.\r\n- To nevadí, skoč mi do vrecka.\r\nPrídu k colníci a colník sa pýta medveďa: \r\n- Medveď, čo to máš vo vrecku?\r\nMedveď si tľapne po vrecku: \r\n- Fotku zajaca.', 328, 3.3, 56),
	(13084, 'Inseminátor odjíždí z kravína, když tu se rozletí vrata a vyběhne za ním krava.\r\n"No co je, co chceš?", ptá se ji.\r\n"Ješte pusu!"', 141, 3.15, 56),
	(13085, 'Ide pes po púšti a hovorí:\r\n"Ak rýchlo nenájdem nejaký strom tak sa asi poštím!"', 88, 2.96, 56),
	(13086, 'Téma na zamyslenie:\r\nMláďa koňa je žriebä, jeho matka je kobyla a jeho otec je žrebec. Tak prečo ich vlastne voláme kone?', 130, 3.08, 56),
	(13087, 'Ide lev po lese, stretne korytnačku a pýta sa jej:\r\n- Korytnačka, kto je pánom zvierat?\r\n- Predsa ty!\r\nLev spokojný ide ďalej, stretne slona a pýta sa ho to isté. \r\n- Slon, kto je pánom zvierat?\r\nSlon zdvihne chobot a domláti ho ako psa. Lev sa po 30 minútach pozbiera a povie:\r\n- Však sa hneď nerozčuľuj, keď nevieš!', 334, 3.5, 56),
	(13088, 'Stretnú sa tri myši a vychvaľujú sa. Jedna vraví:\r\n- Ja som taká silná, že keď doma máme rozostavené pasce, zoberiem syr a keď pružina padá, zachytím ju a zaposilujem si s ňou. \r\nDruhá vraví:\r\n- Ja doma zjem všetky otrávene granule a nikdy sa mi od nich nič nestane. \r\nTretia je stále ticho a napokon povie:\r\n- Tak sa majte, ja si idem užiť s našim kocúrom.', 383, 2.84, 56),
	(13089, 'Ide starý ľadový medveď so synom po  severnom póle a syn sa ho pýta:\r\n- Oci, ja som ľadový medveď, však?\r\n- No jasné, synak. Ja som ľadový medveď, mama je ľadová medvedica a aj  ty si ľadový medveď.\r\n- Oci, a nebudem ja predsa len medvedík koala?\r\n- Veď som ti povedal. Ja som ľadový medveď, mama je ľadová medvedica a aj ty si ľadový medveď.\r\n- Oci, a nebudem ja medveď panda?\r\n- Počúvaj, ja som ľadový medveď, mama je ľadová medvedica a aj ty si ľadový medveď! A prečo sa vlastne pýtaš?\r\n- Keď mne je strašne zima.', 561, 3.29, 56),
	(13090, 'Ktorý vták sa po smrti otočí ešte asi 500-krát? \r\nGrilované kurča.', 74, 2.73, 56),
	(13091, 'Rozprávajú sa dva zajace:\r\n"Dávaj bacha, dneska je poľovačka!"\r\n"No a čo? Však poľovníci aj tak nič netrafia."\r\n"Však áno, ale už ma dvaja ozvracali!"', 163, 3.17, 56),
	(13092, 'Sedia dvaja kohúti na plote a nudia sa. Jeden vraví druhému:\r\n- Hej, poďme si zakikiríkať.\r\n- Ále nie poďme radšej do mesiarne pozrieť holé sliepky.', 159, 3.21, 56),
	(13093, 'Potkan príde do obchodu s televízormi.\r\n- Aký televízor si prajete? ČB, farebný, s ovládaním?\r\n- To je jedno, len aby mal čo najviac kanálov.', 151, 3.08, 56),
	(13094, 'Ide žaba po pláži a stúpi na ňu slon. Žaba vypleští oči a slon na to:\r\n- To pozeráš, aké mám nové plavky!', 119, 2.95, 56),
	(13095, 'Rozprávajú sa dva kapre a jeden sa pýta druhého:\r\n- Veríš na život po vianociach?', 88, 3.39, 56),
	(13096, '"Jano, čo stojí ten pes?"\r\n"Nó, veď ja neviem, prečo si nesadne."\r\n"Ale, ja myslim, koľko stojí."\r\n"Ja ták, nó, asi pol hodiny!"', 137, 3.19, 56),
	(13097, 'Malý macko pred spaním dobiedza do otecka medveďa, aby mu zahral maňuškové divadlo. Otecko najprv že už nie, že je neskoro, ale na neúprosný plač svojho synčeka si na predné laby natiahne ľudské lebky a začne:\r\n- Veliteľ, nie sú tu medvede?\r\n- Nie, tu žiadne medvede nie sú!', 295, 3.14, 56),
	(13098, 'Prečo má káčatko veľké nohy?\r\nAby mohlo zašlapnúť horiacu cigaretu.\r\nA prečo má aj kačka veľké nohy?\r\nAby mohla zašlapnúť horiace káčatko.', 157, 3.28, 56),
	(13099, 'Jsou v lese medvěd, vlk, líška, zajíc, krysa a želva. Děsně se nuděj,\r\ntak vymyslej, že jeden vždycky řekne humor a z ostatních když se tomu\r\naspoň jeden nezasměje, tak toho, co to říkal, zabijou. Medvěd se nabídne a řekne takovej strašnej drtivak,destrojak až se všichni svíjej smíchem po zemi, jenom želva mlči. Zabijou medvěda a říká vlk, taky takovej lepši humor. Všichni se docela smějou, jenom želva mlči, takže zabijou i vlka. Potom musi říkat liška, šílenej mokrač, takže ostatni mlčej, akorat želva říka:\r\n"Aaaa-cha-cha ten medvědúv byl ale dobrej!"', 608, 2.92, 56),
	(13100, 'Príde škriatok za škriatkom - doktorom a hovorí mu.\r\n- Pán doktor ja nemôžem mať deti.\r\nA doktor sa ho pýta\r\n- A mrkvu jéš ?\r\n- Nie. \r\n- No to musíš.\r\nDôjde za týžden a znova to isté.\r\nDoktor sa ho pýta:\r\n- A mrkvu ješ?\r\n- Áno.\r\n- A postrúhanú?\r\n- Nie.\r\n- No to musíš.\r\nDôjde znovu za týžden a hovorí:\r\n- Pán doktor ja stále nemôžem mať deti.\r\n- A mrkvu ješ?\r\n- Áno.\r\n- A postrúhanú?\r\n- Áno, presne ako ste mi povedali.\r\n- A miluješ sa?\r\n- Nie.\r\n- No, ale to musíš.', 506, 3.21, 56),
	(13101, 'Zajačik nájde v lese dupľovku. Prehodí si ju cez plece a ako tak ide, na čistinke narazí na medveďa.\r\n- Hej, medveď, pozri čo mám! Pamätáš, ako si si so mnou onehdy riť vytieral?! Tak teraz sa porátame!\r\nZajko namieri dupľovku na medveďa a hovorí:\r\n- Vidíš tam to kravské hovno? Tak to teraz pekne zožerieš, inak strelím!\r\nMedveď, že veru nezožerie...\r\n- Ako chceš!\r\nZajačik potiahne kohútik a ozve sa iba tiché "cvak". Zajko potiahne druhý kohútik, zasa len"cvak". Zajac pomaličky položí dupľovku do trávy a hovorí:\r\n- No, ak ty teda fakt nechceš, macko, ja by som si vari trochu aj dal...    ', 634, 3.37, 56),
	(13102, 'Mravce tiahnu do boja. V mravenisku nechávajú jediného strážcu. Keď sa vrátia, nájdu mravenisko úplne rozbité, rozhádzané, strážca sa trasie pod listom.\r\n- Čo sa tu stalo? - pýtajú sa mravce.\r\n- Ale, išiel tadeto medveď a šliapol nám na domček.\r\n- A pomstil si sa mu?\r\n- Samozrejme. Išiel som za ním a vysral som sa mu rovno doprostred brlohu!', 367, 3.1, 56),
	(13103, 'Veľké povodne uväznili v lese na malom ostrovčeku kopu zvieratiek. A stále prší ďalej. Zvieratká sú mokré, naštvané a strašne hladné. Lev navrhuje:\r\n- Urobíme to spravodlivo. Roztočíme fľašu a na koho ukáže, toho zožerieme.\r\nVšeobecný súhlas. Roztočili fľašu, ukázala na zajaca. O slovo sa prihlásil diviak:\r\n- No, zajac je môj kamarát a ak mu niekto skriví čo i len ucho, bude mať do činenia so mnou. Jasne?\r\nZvieratká váhajú. Diviak je predsa len veľké zviera a ťahať sa s ním za prsty neradno. Rozhodnú sa točiť fľašou znovu. Čo čert nechcel, zasa ukázala na zajaca. Diviak len zafučal a zvieratká roztočili fľašu po tretí raz. Točila sa, točila a ukázala na diviaka. Zajac na neho pozrie a reve:\r\n- Dokvíkala si, ty sviňa, však?!', 798, 3.38, 56),
	(13104, 'Macko Pu s prasiatkom si vykračujú lesom.\r\n- Kam ideme macko? - pýta sa prasiatko.\r\n- Zmlátiť sviňu!\r\n- Macko a neutečie nám?\r\n- Kam by si utekalo?! ', 157, 3.14, 56),
	(13105, 'Slon sa kúpe vo vode. Príde mravec a presviedča ho, aby vyšiel von. Nakoniec slon vyjde a mravec hovorí:\r\n- Dobre, len som chcel vedieť, či nemáš moje plavky.', 167, 3, 56),
	(13106, 'Vojde žaba na invalidnom vozíku do francúzskej reštaurácie a zreve:\r\n- Tak dobrú chuť!', 93, 3.07, 56),
	(13107, 'Príde korytnačka k stromu a začne hlavou do neho búchať. Hore sedia dva ďatle.\r\n- Mami, kedy jej už povieme, že je adoptovaná?', 135, 3.78, 56),
	(13108, 'Kohút ukazuje sliepkam pštrosie vajce a hovorí:\r\n- Vážené dámy, nechcem Vás kritizovať, chcem Vás však upozorniť na to, čo sa vyrába v zahraničí.', 161, 3.24, 56),
	(13109, 'Beží po lese rodina slimákov a stretne ich medveď. Ten sa ich pýta:\r\n- Prečo tak utekáte? \r\nSlimák mu na to hovorí:\r\n- Ale vieš, v lese je daňová kontrola a ja mám dom, žena má dom, deti majú domy, tak utekáme.\r\nMedveď rozmýšľa a hovorí si:\r\n- Ja musím tiež utiecť, lebo ja mám kožuch, žena má kožuch a deti majú tiež všetky kožuchy.\r\nAko tak beží celá rodina, stretne ich krtko. Keď sa dozvie, čo je vo veci aj on sa zamyslí a dá sa na útek. Ako tak uteká s celou rodinou, prechádza v zoologickej záhrade okolo klietky s paviánmi a pavián sa ho opýta, prečo utekajú. Krtko mu na to odpovie:\r\n- Ale vieš, v lese je daňová kotrola a ja tunelujem, žena tuneluje a aj všetky deti tunelujú, tak utekáme.\r\nPavián mu na to odpovie:\r\n- To musí byť nejaká blbosť, lebo ja mám holú riť, žená má holú riť a aj všetky deti majú holú riť a celý život sme zavretí.', 928, 3.35, 56),
	(13110, 'Sliepka z Očovej zniesla päť kilové vajce. Reportéri zo všetkých krajín sa prišli pozrieť na tento nezvyčajný jav. Pýtajú sa sliepky, ako to dokázala. \r\n- Len som si čupla, potlačila a bolo. \r\n- A vaše plány do budúcnosti?\r\n- Zniesť osem kilové vajce. \r\nReportérom nedalo a išli sa spýtať kohúta, ako to robí. \r\n- Skočím na ňu, zatrasiem sa a je to. \r\n- A vaše plány do budúcnosti?\r\n- Rozbiť pštrosovi hubu.', 443, 3.5, 56),
	(13111, 'Slon zašliapne mravenisko a z celého mraveniska zostanú na žive iba dva mravce. A tak kujú pomstu. Jeden vrvaí druhému:\r\n- Ty ho potkneš a ja ho zaškrtím!', 164, 3.88, 56),
	(13112, 'Je to veľké, hnedé, páchne to a šuští to. Čo je to?\r\nPosraný medveď v igelitovom sáčku.', 99, 3.41, 56),
	(13113, 'Rozhovor dvoch kamarátov:\r\n- Stav sa so mnou o sto korún, že tamten kôň je slepý.\r\n- Dobre, ale ako mi to dokážeš?\r\n- Keď ho buchnem po riti, rozbehne sa a narazí do tej steny pred ním, tak je slepý.\r\nTak sa teda stavia. Jeden buchne koňa po riti, ten sa rozbehne, narazí do steny a je na mieste mŕtvy.\r\n- Vidíš, hovoril som, že je slepý, daj mi sto korún.\r\n- Nie, on nebol slepý, on bol statočný.', 421, 2.77, 56),
	(13114, 'Ide opity medveď po lese. Vidí ho zajac a rozhodne sa, že ho riadne zmláti.\r\nNa druhý deň medveď ide za kráľom zvierat, levom. Ten zvolá všetky zvieratá\r\na medveďa sa opýta:\r\n"Čo si si zapamätal zo včerajška?"\r\n"Neviem toho veľa, ale som si istý, že ten bitkár mal niečo dlhé na hlave."\r\nZajac sa v zástupe nakloní ku slimákovi a povie:\r\n"Prihára ti, čo, ty hajzel!"', 395, 3.45, 56),
	(13115, 'Malý komár sa pýta svojej mamy:\r\n- Bzzzzzz. Mami a môžem ísť do divadla?\r\n- Ale vieš, že je to nebezpečne.\r\n- Mami, ale keď ja chcem.\r\n- Bzzzzz dobre, ale dávaj pozor pri tlieskaní.', 194, 2.74, 56),
	(13116, 'Ježko príde do prístavu a pýta sa rybárov:\r\n"Máte lep?"\r\n"Nie!", odpovedajú mu rybári.\r\nPríde na druhý deň a hovorí im:\r\n"Tak tu máte ten lep!"', 156, 3.18, 56),
	(13117, 'Idú medveď a zajko na motorke. Medveď zrýchľuje a pýta sa zajka pri 80km/h:\r\n- Zajko bojiš sa?\r\n- Nie, hovori zajko.\r\nPri 160km/h sa medved pýta zajka:\r\n- Bojiš sa?\r\n- Nie, odpoveda zajko.\r\nNa druhý deň sa to isté zopakuje, len naopak.\r\nZajko začne zrýchlovať a pri 150km/h sa pýta medveďa:\r\n- Medveď, bojiš sa?\r\n- Nie, odpovedá medveď.\r\nZajko na to:\r\n- Ale mal by si sa, lebo nedotiahnem na brzdu.', 419, 3.19, 56),
	(13118, 'Ako predísť tomu, aby mlieko neskyslo?\r\nNechať ho v krave.', 61, 2.9, 56),
	(13119, 'Prechádza sa ochranca zvierat po parku, keď tu zrazu v plnej rýchlosti do neho vrazí vtáčik a spadne na zem. Ochranca sa nad ním zľutuje, zoberie si ho domov, dá ho do klietky, dá mu vodu, kúsok chleba a odíde preč.  Onedlho sa vtáčik preberie, pozerá okolo seba a vraví:\r\n- Mreže, voda, suchý chleba. Ja som toho človeka zabil!\n', 349, 3.43, 56),
	(13120, 'Príde zajac do krčmy, vyhrnie si rukávy a zreve:\r\n- Kto mi zabil brata?\r\nMedveď sa postaví:\r\n- Ja. \r\nZajac si dá dole rukávy a povie:\r\n- Ej, ale sa tu ochladilo.', 168, 3.24, 56),
	(13121, 'Malý zajačik vojde do baru a pýta sa barmana:\r\n- Koľko stojí obyčajná kvapka vodky?\r\n- Nič. Kvapka sem-kvapka tam...\r\n- Tak dobre. Prosím si tisíc kvapiek vodky.', 171, 3.17, 56),
	(13122, 'Aké je najväčšie trápenie zvierat?\r\nDať veľkému hadovi viagru.', 70, 2.77, 56),
	(13123, 'Príde kohút do pôrodnice a sestrička vraví:\r\n- Blahoželám, je to vajce.', 78, 3.07, 56),
	(13124, 'Idú dva slony po púšti a stretnú nahého muža. Obzerajú si ho zdola, zhora, spredu, zozadu.... A potom sa začudovane jeden pýta druhého:\r\n- Ako si len tento dáva jedlo do úst?', 186, 3.17, 56),
	(13125, '- Tak som musel utratiť môjho psa.\r\n- A čo, bol besný?\r\n- No nadšený nebol.', 81, 3.19, 56),
	(13126, 'Schôdza na roľníckom družstva, predseda  pojednáva o úspechoch v živočíšnej výrobe.\r\n- A osobitne by som chcel vyzdvihnúť súdružku Malú za mlieko a súdruha Tupého za vajcia.', 191, 3.02, 56),
	(13127, 'Sedí zajac na pníku a onanuje. \r\nVedľa neho stojí fľaša vody.\r\nZajac si pospevuje:\r\n"Vždy som mal rád chlast a ženy!"', 126, 3.31, 56),
	(13128, 'Ide si malý mamutko po lese a zrazu ho prepadne stádo slonov. Sloni ho zmlátia, dokopú a odídu preč. Mamutko sa postaví, otrasie sa a zanadáva:\r\n- Zasraní skinheadi!', 174, 3.47, 56),
	(13129, 'Dva králiky prenasledovala svorka vlkov. Podarilo sa im utiecť do nepreniknuteľnej húštiny, a keď si trochu vydýchli, vraví jeden druhému:\r\n- Myslíš, že bude lepšie utekať ďalej, alebo počkať, kým získame početnú prevahu?', 242, 2.98, 56),
	(13130, 'Spitý mravec sa preberie z opice. Otvorí oči a zistí, že leží na tanku. Poškrabe si hlavu a povie:\r\n- Keď sa ožerem, hocijakú chujovinu dovlečiem domov!', 164, 3.53, 56),
	(13131, 'Príde žaba do lekárne so sáčkom na hlave a lekárnik sa jej zhrozene pýta:\r\n- Preboha, čo vám je?\r\nŽaba: \r\n- Čo čo mi je? Toto je prepad.', 148, 3.52, 56),
	(13132, 'Leží zajac na lúke a oddychuje. Tu k nemu pribehne jeleň, vidí zajaca, tak ho len preskočí a zajac na to: \r\n- Waw!\r\nJeleň si to nevšíma, ale keď sa vracia, znovu natrafí na zajaca, preskočí ho a zajac zasa len: \r\n- Waw!\r\nKeď už jeleň tretí raz ide po lúke a preskočí zajaca, aby ho nezranil a zajac zasa len to svoje WAW, už mu to nedá, zastaví a nahnevane vraví: \r\n- Počuj zajo, prečo stále vravíš len to WAW, keď cez teba skáčem, niečo sa ti nezdá?\r\nZajac sa len vystrašene ospravedlňuje: \r\n- Ale nie pán jeleň, len mi jedno nejde do hlavy. S takým veľkým a mať toľké parohy?', 622, 3.49, 56),
	(13133, 'Muž s nemeckou dogou sa prechádza po meste a rozhodne sa ísť do reštaurácie. Dogu priviaže pred dvere a vojde. Po chvíli za ním príde vrchný a vraví:\r\n- Pane,  tá nemecká doga pred dverami je vaša?\r\n- Áno, stalo sa niečo?\r\n- No, viete, neviem ako vám to povedať, ale môj pes tu dogu zabil.\r\n- To je zaujímavé. A akého máte psa?\r\n- Jazvečíka.\r\nMuž sa začne smiať.\r\n- Chcete povedať, že váš jazvečík zabil moju dogu?\r\n- Myslím, že áno. On jej totiž zaskočil v krku.   ', 506, 3.39, 56),
	(13134, 'Letí medveď, zajac a káčer v lietadle.\r\nKáčer hovorí medveďovi:\r\n- Naval cigu.\r\nMedveď sa naštve, ale dá mu cigaretu.\r\nKáčer medveďovi:\r\n- A pripáliť netreba?\r\nMedveď už pení zúrivosťou, ale pripáli.\r\nZajac nato:\r\n- A mňa nevidíš?\r\nMedveď nepríčetný zlosťou ich oboch vyhodí z lietadla a ako tak padajú pýta sa káčer zajaca:\r\n- Lietať vieš?\r\n- Nie.\r\n- Tak prečo rýpeš do medveďa!?', 421, 3.69, 56),
	(13135, 'Muž si kúpi papagája. O pár dní sa dozvie, že mu už ženu pomiloval, psa, mačku, sliepky i zajace. Rozhodol sa, že ho dá trochu schladiť do mrazničky. Keď ju po týždni otvorí, nájde papagája spoteného. \r\n- Papagaj, povedz mi ako je to možné? \r\nPapagaj na to: \r\n- Veď skús roztiahnuť nohy tým zmrznutým kurencom.', 337, 3.51, 56),
	(13136, 'Sedí prasiatko na borovici a je čerešne. Ide okolo vĺčik, a spovedá. \r\n- Čo robíš prasiatko?\r\n- Jem čerešňe.\r\n- A nevrav na borovici čerešne, nebuď sprostučký.\r\n- Doniesol som si.', 196, 3.3, 56),
	(13137, 'Vrabec sa "hrá" so sýkorkou.\r\nSýkorka mu roztúžene hovorí: Hlbšie, hlbšie, hlbšie....\r\nA vrabec na to: Čim, Čim', 122, 3.28, 56),
	(13138, 'Kohút sa prechádza po trhovisku. V tom zbadá stánok s grilom, kde sa smažia kurčatá. Naserie sa a povie:\r\n"No jasné! Sauny, solária, kolotoče a na dvore niet koho pomilovať!"', 185, 3.51, 56),
	(13139, 'Čo si myslí sliepka, keď ju naháňa kohút?\r\nEšte tri kroky, aby si nemyslel, že som kurva.', 97, 3.4, 56),
	(13140, '"Pardon!" - povedal jež, a zišiel z kefy.', 43, 3.28, 56),
	(13141, 'Sedliak prijíma nového opatrovateľa zvierat. Pýta sa ho\r\n- A rozumiete koňom?\r\n- Prečo? Niečo hovorili?', 110, 3.52, 56),
	(13142, 'Pozval medveď všetky zvieratká z lesa na párty a povedal im, že každé z nich mu musí priniesť pekný a hodnotný darček, ináč ho svojim veľkým vtákom "vymastí" po chrbte. Prišiel vlk a daroval mu hi-fi súpravu. Medveď sa potešil a nazval ho kamarátom. Líška mu priniesla farebný televízor, veľká kamarátka a podobne aj ostatné zvieratká, keď tu zrazu dôjde na rad zajac a daruje mu obyčajnú malinu. Maco sa naserie,vytiahne svojho veľkého vtáka a trestá ním zajačika po chrbte jedna radosť. Ten sa však začne strašne rehotať. \r\n- Čo je zajko, teba bitka nebolí? - pýta sa medveď\r\n- Ej bolí ma to, bolí, ale nemôžem sa nesmiať keď vidím, že ježko ti nesie obyčajnú slivku...', 733, 3.5, 56),
	(13143, 'Kedy má ovca najviac vlny? \r\nKeď je na nej aj baran.', 54, 3.15, 56),
	(13144, 'Ide medveď po lese a vidí, ako slon lezie na strom. \r\n- Prečo lezieš na ten strom?\r\n- Lebo mám rád jabĺčka.\r\n- Ale veď to je jedľa!\r\n- To nevadí, ja mám jabĺčka so sebou.', 184, 3.05, 56),
	(13145, 'Ide kliešť po lese a strašne nadáva: \r\n"To ma zase dnes všetci vytočili..."', 81, 3.37, 56),
	(13146, 'Na výletnej lodi predvádza kúzelník svoje kúzla. Kedže každý týždeň sú iný návštevníci, predvádza stále to isté. Lenže kapitánov papagáj stále prezrádza, ako kúzelník podvádza. Raz sa loď potopí, a na jednej doske ostane len papagáj a kúzelník. Prvý deň pozerajú na seba nevraživo, druhý deň tak isto a na tretí to už papagáj nevydrží a pýta sa: \r\n- Dobre, vzdávam sa, tak kde si dal tú loď.', 438, 3.46, 56),
	(13147, 'Beží vystrašený vlk po lese a stretne zajaca. Ten sa ho pýta:\r\n- Čo si taký vyľakaný, vĺčko?\r\n- Nóó... po lese chodí lev a každému, kto má tri vajcia, ich odtrhne...\r\n- Tak to sa nemusíme báť, vĺčko. Ja mám dve, ty máš dve...\r\n- Nóó... lev najprv trhá a až potom ráta!              ', 312, 4.13, 56),
	(13148, 'Príde medvedík do brlohu a vraví bračekovi medvedíkovi:\r\n- Dostali sme desať pohárikov medu. Rozdelil som ich spravodlivo, tebe osem a mne osem.\r\n- Počkaj, počkaj, ale veď osem a osem nie je desať! - odporuje braček medvedík.\r\n- To je jedno, ja už som si svojich osem pohárikov zjedol...              ', 316, 3.71, 56),
	(13149, 'Sedia dve sovy na strome a jedna hovorí:\r\n"Huuuu!"\r\nDruhá na to:\r\n"Čo ma strašíš?!"              ', 103, 3.13, 56),
	(13150, 'Príde zajac do mäsiarstva a pýta sa:\r\n"Máte bravčové?"\r\n"Áno."\r\nV tom zajac vytiahne pištoľ, odstrelí mäsiara a povie:\r\n"To máš za prasiatko."              ', 169, 2.78, 56),
	(13151, 'Príde dievčatko do Chovproduktu:\r\n"Chcela by som nejaké morčiatko!"\r\n"A aké chceš? Krásne biele alebo také to pekne šedivé?"\r\n"To je jedno, môjmu hadovi na farbe nezáleží."              ', 200, 3.62, 56),
	(13152, 'Príde domov kliešť cely smutný. A ostatné kliešte sa pytaju: "Prečo si taký nasratý a smutný?" \r\nA on im odpovedá: "Zasa ma vytočili."              ', 160, 3.53, 56),
	(13153, 'Viete prečo má prasiatko zatvorené oči, keď cicia mliečko?\r\nNo aby nevidelo, že jeho matka je sviňa.              ', 122, 3.91, 56),
	(13154, 'Vlk chytil zajaca.\r\n- Dobre zožer ma, ale splň mi aspoň posledné želanie, prosí ušiačik.\r\n- Dovoľ mi, aby som si zatancoval Tanec smrti.\r\nVlk, známy to  milovník folklóru, súhlasil. Zajac začal tancovať. Krok doprava, krok doľava. Tri doprava, štyri doľava... A uteká ozlomkrky preč.\r\nVlk sa za ním ohúrene pozerá: \r\n- To je ale poriadne hlúpa choreografia!              ', 395, 3.83, 56),
	(13155, 'Letí orol a cíti, že mu niekto sadol na chrbát. Obzrie sa a vidí, že je to malý vrabec. No dobre, myslí si orol, možno je unavený. Za pár minút pozerá a vidí, ako si vrabec vytiahol vodku, zapálil si cigaretu a pozerá si erotický časopis. Orol prekvapene pozerá na vrabca a ten mu hovorí:\r\n- Čo čumíš chuju, sleduj cestu!              ', 359, 3.78, 56),
	(13156, 'Had sa pýta hada sme mi jedovatý prečo sa pýtaš lebo som si kúsol do jazyka a teraz ma boli.              ', 112, 2.38, 56),
	(13157, 'Sťažuje sa nový majiteľ psa:\r\n- Keď mi ho predávali, tvrdili, že pouva na slovo. Len nepovedali na ktoré!              ', 127, 2.54, 56),
	(13158, 'Stretnú sa tri myši a vychvaľujú sa. Prvá vraví:\r\n- Ja som taká silná, že keď sú po dome rozostavené pasce, zoberiem syr, a keď pružina padá, zachytím ju a posilňujem s ňou.\r\nDruhá vraví:\r\n- Ja v dome zjem všetky otrávené granuly a nikdy sa mi od nich nič nestane.\r\nTretia načúva a napokon povie:\r\n- Tak sa majte! Idem sa pohrať s naším kocúrom!              ', 389, 4, 56),
	(13159, 'Ide si tak chlapík popri plote a zrazu sa mu chce strašne čúrať. Uvidí v plote dieru, tak ho tam fukne a čúra. Ako tak čúra, spozoruje cez plot v záhrade kozu, ako sa k nemu blíži.\r\nA kričí:\r\n"Koza, choď preč, nepočuješ, koza jedna, kozaa, kozičkaaaa...              ', 287, 3.9, 56),
	(13160, 'Lev kráľ zvierat dostane od Boha 3 vrecka cukríkov, chce ich rozdeliť spravodlivo, tak že si jedno vrecko nechá a dva rozdelí, a hovorí: múdre zvieratka do jedného radu, pekne do druhého. V tom sa spoza davu ozve žaba: A ja sa mam roztrhnúť?              ', 269, 3.2, 56),
	(13161, 'Viete prečo má prasiatko zatvorené oči keď cicia mliečko?\r\nNo aby nevidelo, že jeho matka je sviňa.    \n', 112, 3.5, 56),
	(13162, 'Stretne zajac kozu, a zajac fajčí fajku.\r\n"Taký malý a už fajčí!", hovorí mu koza. A zajac sa nedá: \r\n"Taká veľká a chodí s nahými ceckami!\n', 154, 4, 56),
	(13163, 'Medveď a zajac chytajú ryby. Chytia zlatú rybku, ktorá im za pustenie sľúbi 3 želania. \r\nMedveď si žela prvý: \r\n"Tak ja chcem, aby tu pri mne bola krásna medvedica s veľkým poprsím, aby som mal takú doma a za každým stromom \r\nv lese bola taká."\r\nStalo sa. Želá si zajac: \r\n"No, tak ja chcem hondu, do nej benzín a to tretie želanie - nech je medveď buzerant."              ', 396, 3.88, 56),
	(13164, 'Ide medveď po lese a stretne zajaca. Zajac sa pýta:\r\n– Kam ideš, medveď?\r\n– Nakupovať do Rakúska.\r\nZajac na to:\r\n– Išiel by som s tebou, ale nemám pas.\r\n– To nič, skoč mi do vrecka.\r\nPrídu k colnici a colník sa pýta medveďa:\r\n– Medveď, čo to máš vo vrecku?\r\nMedveď si tľapne po vrecku:\r\n– Fotku zajaca!\n', 335, 3.5, 56),
	(13165, '"My máme toľko koní, že ich do večera gázom neobídeme.\r\n"Aj my máme takého gáza."              ', 105, 3.33, 56),
	(13166, 'Dežovi ušiel papagáj. Ide na políciu. Úradník sa ho pýta:\r\n"A vedel aj rozprávať?"\r\n"A ako, veď preto chcem, aby ho nehľadali deti!"              ', 157, 3.25, 56),
	(13167, 'Mucha a žaba: \r\n"Bzzz, bzzz, bzzz..." \r\n"Mľask... Prrrd..."\r\n"Bz, bz, bzzz, bzzz, bzzz..."              ', 106, 2.55, 56),
	(13168, 'Po daždi vylezie dážďovka, poobzerá sa a vidí, že oproti nej vylieza druhá. \r\n"Ó, ako sa máte, milostivá? \r\nA kde máte starého?" \r\n"Ale, vytiahli ho na ryby!"              ', 185, 3.56, 56),
	(13169, 'Sedí žaba na brehu močiara \r\na kváka si: \r\n"Teraz keď beriem tabletky, už sa nemusím báť bociana."              ', 121, 3.17, 56),
	(13170, 'Leží zajac v priekope so zlomenou nohou a preskočí ho jeleň. Zajac ho zavolá a poprosí ho, aby ho preskočil ešte raz. Jeleň ho poslúchne a preskočí ho. To celé sa opakuje asi trikrát, potom si zajac zavolá jeleňa naposledy a vraví:\r\n"Teda jeleň, s takým čurákom by som si ja parohy nasadiť nenechal."              ', 337, 4, 56),
	(13171, 'Aký je rozdiel medzi kohútom \r\na sliepkou ??????\r\nKeď chytíš kohúta medzi nohy zakikiríka.......\r\nKeď chytíš sliepku medzi nohy .......uvarí, operie, ožehlí ti ......              ', 193, 3.64, 56),
	(13172, 'Zajac hovorí veveričke: "Veverica, vyfajči mi ho!"\r\n"Zajac, keď ja neviem?!" \r\n"Veverica, vyfajči mi ho, už nevydržím!" \r\n"Ale zajac, ja by som rada, ale keď ja to neviem." "Veverica, tak mi ho vyfajči ako vieš.\r\n"CHRUMST...."               ', 252, 3.8, 56),
	(13173, '"Aké zviera je slepé?" \r\n"Krtko." \r\n"Ale kdeže! To hovädo, čo rozhodovalo zápas Slovensko-Kanada."              ', 118, 3.65, 56),
	(13174, 'Leží ježko na ježkovi. "Miláčik, nepichám ťa?" \r\n"Nekecaj a pichaj."               ', 91, 2.7, 56),
	(13175, 'Blcha miluje slona odzadu, slon stúpi na pripinačku a strašné zreve. A blcha nato: Rev ty diabol!!!!!              ', 119, 3.2, 56),
	(13176, '- váš pes mi dnes ráno odvliekol papuče,\r\n- sřažuje sa sused\r\n- to nie je možné veď domov prišiel bosý!              ', 128, 3, 56),
	(13177, 'Kocúr na streche dvorí mačke. Chodí okolo nej a lichotí jej. Nakoniec jej do uška zašepká:\n"Umrel by som pre teba..."\n"A koľkokrát?" pýta sa mačka.              ', 173, 3.11, 56),
	(13178, '- Ako to, že vášho ratlíka voláte strážnym psom?\n- Však ho treba strážiť, aby ho niečo neprešlo.              ', 123, 3.69, 56),
	(13179, 'Prečo psi brešú na autá?\nLebo ich zlostí, že musia behať po svojích.              ', 90, 3, 56),
	(13180, 'Stretne žirafa myšku a hovorí jej:\r\n”Neverila by si, aké je to super mať dlhý krk. Dosiahnem vďaka nemu na najdlhšie konáre a keď papám chutnučké jedlo, trvá to príjemne dlho, kým mi prejde krkom...”\r\nMyška sa zamyslí a hovorí jej:\r\n”A už si niekedy grcala...?”              ', 303, 4.09, 56),
	(13181, 'Príde had do obchodu a hovorí:\r\n”Jeden bicykel.”\r\nPredavač mu na to :\r\n”Načo vám bude bicykel, veď nemáte nohy!”\r\n”To je pre syna...”              ', 166, 3, 56),
	(13182, 'Kde ideš krtko?\r\nNo a čo, že som čierny.              ', 58, 2.58, 56),
	(13183, 'Príde žaba k fotografovi a ten jej hovorí:\r\n-Keď ti dám znamenie, povedz džem, aby si mala malé ústočká.\r\nFotograf dá znamenie a žaba:\r\n-Lekvááár.              ', 175, 4, 56),
	(13184, 'Ide princ po lese a stretne žabu.\r\n-Princ, daj mi pusu.\r\n-Fuj, to nikdy!\r\nŽaba sa nevzdáva:\r\n-Princ, daj mi pusu a niečo dostaneš!\r\nPrinc jej dá pusu a pýta sa:\r\n-Tak čo dostanem?\r\n-Herpééés!              ', 216, 2.78, 56),
	(13185, 'Dva hady na púšti:\r\n”Počuj, my sme jedovaté?”\r\n”Prečo?”\r\n”Práve som si zahryzol do jazyka.”              ', 123, 2.19, 56),
	(13186, 'Sedia dve opice na palme a jedna je banán. Druhá sa pýta:\r\n”Čo to robíš?”\r\n”Jem banán.”\r\n”A prečo je taký hnedý?”\r\n”Pretože ho jem druhý raz.”              ', 184, 3.63, 56),
	(13187, 'Hovorí vlk líške:\r\n”Ty líška, poď, zbijeme zajaca.”\r\n”Ale aký budeme mať dôvod?”\r\n”Keď bude mať na hlave čiapku preto, keď nebude, tak preto.”\r\nIdú a strašne zbijú zajaca. Na druhý deň vlk zase začne:\r\n”Ty líška, poď, zbijeme zajaca.”\r\n”A dnes zase prečo?”\r\n”Vypýtame si od neho cigaretu. Ak nám dá s filtrom preto, ak bez filtra preto.”\r\nPrídu k zajacovi a vlk hovorí:\r\n”Zajac, daj nám cigaretu!”\r\nNa čo zajac:\r\n”A chcete s filtrom, alebo bez filtra?”\r\n”Pozri sa na hajzla, zase nemá čiapku!”              ', 575, 4.09, 56),
	(13188, 'V lese sa koná maškarný ples. Lienka si doma napchá do úst tvaroh a ide na ples. Mravec sa jej pýta: "A ty si za čo preoblečená?" Lienka vystriekne tvaroh mravcovi medzi oči a povie: "ja som vyrážka, ty hovado!"              ', 237, 4, 56),
	(13189, 'Pani, priniesol som Vám Vášho papagája...\r\nAle veď je to mačka...\r\nTo je. A papagája máte v nej!              ', 118, 3.5, 56),
	(13190, 'Ide agresívne prasiatko po lese a spadne do jamy. Príde k nemu žirafa a hovorí:\r\n-"Počkaj prasiatko, prinesiem ti rebrík."\r\n-"Nepočkám!!!"              ', 160, 3, 56),
	(13191, 'Idú dvaja poľovníci na lov do džungle a jeden z nich hovorí:\r\n-Aha, tam letí slon...A tam druhý...\r\nA druhý poľovník na to: \r\n-Bože prečo! \r\n-Čo sa čuduješ. Asi tam majú niekde hniezdo.              ', 215, 3, 56),
	(13192, 'Zvieratká si usporiadali hostinu. Chýbalo im šampanské. Poslali do obchodu slimáka. Slimáka čakali 3,4,5,6,7 hodín a zvieratká už začali nadávať. Z kríku sa ozval slimák. Ak budete na mna nadávať, tak ani nepôjdem!              ', 246, 3.98, 56),
	(13193, 'Kocúr na streche dvorí mačke. Chodí okolo nej a lichotí jej. Nakoniec jej do uška zašepká:\r\n"Umrel by som pre teba..."\r\n"A koľkokrát?" pýta sa mačka.              ', 175, 4.06, 56),
	(13194, 'K jednému astrológovi zavolá žabiak a chce si dať urobiť horoskop. Nadiktuje číslo svojej visa karty a dátum narodenia. Astrológ chvíľku niečo počíta a povie: \r\n”Tak, zajtra stretnete nádhernú mladú slečnu, ktorá o vás bude chcieť vedieť úplne všetko.”\r\n”Naozaj? To je fajn... a kde ju stretnem? Na nejakej párty?”\r\n“Nie, na jej hodine biológie.”               ', 400, 3.75, 56),
	(13195, 'Oco, prečo mám tak veľa chlpov?\r\nLebo si medveď, ty idiot!\n', 63, 3.71, 56),
	(13196, 'Príde žaba do lekárne so sáčkom na hlave a lekárnik sa jej zhrozene pýta:\r\n"Preboha, čo vám je?"\r\nŽaba na to:\r\n"Čo čo mi je? Toto je prepad."              ', 167, 3.97, 56),
	(13197, 'Po púšti ide slon a pýta sa veveričky koľko je hodín. Veverička pozrie do chladničky na teplomer a povie trištvrte na jeseň. Slon nastúpi na autobus a odíde vlakom.              ', 190, 2.48, 56),
	(13198, '- Všade vidím samých mamutov! Doma mamuty, v skrini mamuty, v práci mamuty, na ulici mamuty...\r\n- A skúšal si s tým ísť za psychiatrom?\r\n- Áno, ale sedel tam len mamut...              ', 194, 3.94, 56),
	(13199, 'Rybár uloví zlatú rybku. Bez rozmýšľania ju zvesí z udice a hodí späť do vody. Rybka sa prekvapená vynorí a pýta sa ho:\r\n”A tri želania nebudú?”\r\n”A čo by si chcela?              ', 201, 4.17, 56),
	(13200, 'Ide pes po púšti a hovorí:\r\n"Keď nenájdem vodu, tak sa utopím!"               ', 84, 2.4, 56),
	(13201, 'Komár a slonica sa milujú. Slonici vletí do chobotu osa a poštípe ju. Tá začne od bolesti strašne revať. Komár spokojný sám so sebou povie: ”Len krič, maličká, len krič!”              ', 204, 3.25, 56),
	(13202, 'Stretnú sa dve mačky. Jedna vraví:\r\n”Ahoj, ako sa máš?”\r\nA druhá na to:\r\n”Meee!”\r\n”Prosím ťa, čo blbneš?” čuduje sa prvá.\r\n"No čo, učím sa cudzie jazyky.”\n', 184, 3, 56),
	(13203, 'Príde malý slimák k veľkému a hovorí:\r\n”Počúvaj, nikdy neviem, ako mám prechádzať cez cestu.”\r\nVeľký slimák sa zamyslí a povie:\r\n”Nóóóó. Keď uvidíš dve svetlá, postav sa do stredu, to bude auto. Keď uvidíš jedno svetlo, postav sa buď na ľavú alebo na pravú stranu, to bude bicykel. Dobre?”\r\n”Áno, rozumiem.”\r\nTak už malý slimák ide cez cestu a uvidí dve svetlá. Postaví sa do stredu a čaká. O chvíľu počuje veľký slimák ’CHRST’ a vraví si:\r\n”Hmm, parný valec tadiaľto už dávno nešiel!”              ', 570, 4, 56),
	(13204, 'Sedia dve muchy na hovne a jedna si prdne. Tá druhá jej vraví: "Fúj, pri obede ?!"              ', 100, 3.44, 56),
	(13205, 'Letí netopier, po chvíli narazí do skaly a šomre si:\r\n”Doparoma, kvôli tomu walkmanu sa raz zabijem.”\n', 111, 3.22, 56),
	(13206, 'Hovorí slon mravcovi:\r\n”Nemotaj sa mi pod nohy, lebo keď ťa pristúpim, tak z teba ostane len mastný fľak.”\r\n”No, no, no, to sa ti hovorí, keď som po operácii!”              ', 190, 2.5, 56),
	(13207, 'Zajac sedí na konári a reže ho pod sebou, ide okolo medveď a vraví mu:\r\n”Zajac, spadneš!”\r\n”Ja? A prečo?” čuduje sa zajac a veselo reže ďalej.\r\n”Zajac, ale vážne spadneš.” dohovára mu medveď.\r\nV tomto duchu konverzácia pokračuje, až kým zajac nedoreže konár a nespadne. Zajac sa pozbiera zo zeme divoko sa rozbehne preč a strašne kričí:\r\n”ČARODEJNÍK, ČARODEJNÍK!!!”              ', 424, 3.75, 56),
	(13208, 'Vrana spí na  konári a zrazu  spadne.\r\nO päť  minút sa  prebudí a vraví:\r\n"čvirik, čvirik, hú, hú do riti jak to bolo!"              ', 144, 3.78, 56),
	(13209, 'Pasú sa dve kravy na lúke. Po dlhom čase zrazu jedna povie: ”Múúúú.”\r\nDruhá jej na to: ”Práve si mi zobrala slovo z úst.”              ', 153, 3.17, 56),
	(13210, 'Muž si kúpi papagája. O pár dní sa dozvie, že mu už pomiloval ženu, psa, mačku, sliepky i zajace. Rozhodol sa, že ho dá trochu schladiť do mrazničky. Keď ju po týždni otvorí, nájde papagája spoteného. ”Papagáj, povedz mi, ako je to možné?”\r\nPapagáj na to:\r\n”Veď skús roztiahnuť nohy tým zmrznutým kurčatám.”              ', 360, 2.8, 56),
	(13211, 'Muž s nemeckou dogou sa prechádza po meste a rozhodne sa ísť do reštaurácie. Dogu priviaže pred dvere a vojde. Po chvíli za ním príde vrchný a vraví:\r\n”Pane, tá nemecká doga pred dverami je vaša?”\r\n”Áno, stalo sa niečo?”\r\n”No, viete, neviem ako vám to povedať, ale môj pes tú dogu zabil.”\r\n”To je zaujímavé. A akého máte psa?”\r\n”Jazvečíka.”\r\nMuž sa začne smiať.\r\n”Chcete povedať, že váš jazvečík zabil moju dogu?”\r\n”Myslím, že áno. On jej totiž zaskočil v krku.”              ', 545, 3.67, 56),
	(13212, 'Počul som, že v Bratislave bola surovo potlačená demonštrácia proti vianočným sviatkom.”\r\n”A kto, prosím ťa, demonštroval?”\r\n”Kapry.”              ', 168, 3.67, 56),
	(13213, 'Macko Pu s prasiatkom si vykračujú lesom.\r\n”Kam ideme macko?”\r\npýta sa prasiatko.\r\n”Zmlátiť sviňu!”\r\n”Macko a neutečie nám?”\r\n”Kam by si utekalo?!”              ', 185, 3.5, 56),
	(13214, 'Príde rozhorčený muž z ĽADOVÝM MEDVEĎOM do obchodu so zvieratami.\r\nSkríkne na predavača:\r\n- Kde je ten zasran, čo mi pred rokom predal toho bieleho škrečka?!              ', 183, 3.11, 56),
	(13215, 'Býk sa vrátil z arény na farmu a mrle si:\r\n”No a čo, tak som farboslepý...”              ', 98, 3.83, 56),
	(13216, 'Lektor v Zoo ukazuje:\r\n”Toto je korytnačka slonia.”\r\n”Hej? A kde má chobot?”              ', 100, 3.5, 56),
	(13217, 'Ide slon s mravcom po moste a mravec hovorí:\r\n"Ej, ale dupeme..."              ', 80, 3.78, 56),
	(13218, 'Hrajú sa slon a blcha na schovávačku. Blcha sa schovala slonovi do zadku. Slon má veľké problémy ju nájsť a hovorí:\r\n”Kde do riti sa tá blcha schovala.”\r\nBlcha vylezie a hovorí:\r\n”Neplatí, ty si sa pozeral!”              ', 242, 3.93, 56),
	(13219, 'Príde Peter ku zverolekárovi a pýta sa ho:\r\n”Pán doktor, môžete mi povedať, prečo mi zdochla koza?”\r\n”Asi musela niečo zožrať.”\r\n”To nie.”\r\n”A prečo nie?”\r\n”Lebo som jej už mesiac nedal nažrať.”              ', 243, 3.92, 56),
	(13220, 'Dva barany sledujú, ako bača strihá ovce.\r\nStarší povie mladšiemu:\r\n”Pozri, teraz bude poriadny striptíz.”\n', 118, 3.67, 56),
	(13221, 'Ufrfľaná žaba si sadne na papuľu krokodíla a hovorí:\r\nTo je strašné! Komárov je málo, voda je studená a ešte aj krokodíl sa mi na zadok prilepil!”              ', 175, 2.56, 56),
	(13222, 'Medvedica hovorí starému medveďovi, ktorý nemôže zaspať:\r\n”Koľkokrát ti mám hovoriť, že v októbri si už nemáš dávať kávu!”              ', 159, 3, 56),
	(13223, 'Sedia dve sovy na strome a jedna hovorí:\r\n”Hu hu huuu!”\r\nDruhá na to:\r\n”Ty koza, čo ma strašíš!”              ', 124, 2.8, 56),
	(13224, 'Víde naštvaný kliešť z lesa a hovorí:\r\n"Dnes ma už dva krát vytočili!"              ', 93, 4, 56),
	(13225, 'Ide ťava po púšti a stretne agenta Jamesa Bonda. Agent sa predstaví:\r\n”Bond! James Bond!”\r\nA ťava slušne odpovie:\r\n”Bloud! Velbloud!”              ', 161, 3.64, 56),
	(13226, 'Príde prasiatko ku elektrickej zástrčke a hovorí:"A teba sem kto zamuroval?"              ', 94, 3.17, 56),
	(13227, 'Príde vlk za líškou a hovorí: Poď,ideme zbiť zajaca. Líška nato: Prečo? Keď bude mať čiapku, tak preto, ak nie, tak preto,že ju nemá. Tak idú a brutálne zbijú zajaca.\r\nNa druhý deň príde zase vlk za líškou a hovorí: Poď, ideme zbiť zajaca. Líška nato: Prečo? Vypýtame si cigaretu a ak nám dá s fitrom tak preto, ak bez fitra, tak preto. Tak idú a hovoria zajacovi: Daj nám cigaretu. Zajac sa ich opýta: Chcete s filtrom alebo bez filtra? A vlk nato: Pozri ho hajzla, zas nemá čiapku.              ', 533, 3.8, 56),
	(13228, 'Príde korytnačka k stromu a začne do neho búchať hlavou. Hore sa rozprávajú dva ďatle:\r\n”Kedy jej už povieme, že je adoptovaná?”              ', 157, 3.67, 56),
	(13229, 'Razia si to dva polárne medvede po púšti a jeden hovorí tomu druhému:\r\n”Tu musela byť iná zima, keď to tu tak posypali pieskom!”              ', 154, 2.6, 56),
	(13230, 'Sedí hroch po krk v blate, prdí a pozoruje ako bublinky vyskakujú z blata. Pribehne opica a kričí na neho:\r\n”Hej, tlsťoch, tu neďaleko v blate uviazol slon. Poď rýchlo, pomôžeme ho vytiahnuť...”\r\n”No akurát!” odmieta hroch. ”Ja teraz všetko nechám tak a začnem sa blbosťami zaoberať, to určite.....”              ', 344, 2.82, 56),
	(13231, 'Malý macko pred spaním dobiedza do otecka medveďa, aby mu zahral maňuškové divadlo. Otecko najprv odmieta, že je neskoro, ale na neúprosný plač svojho synčeka si na predné laby natiahne ľudské lebky a začne:\r\n”Veliteľ, nie sú tu medvede?”\r\n”Nie, tu žiadne medvede nie sú!”              ', 313, 2.85, 56),
	(13232, 'Miluje sa kanec s kozou.\r\nKoza: ”Nieeeee nieeee!”\r\nSviňa: ”Ale no, no, no.”              ', 98, 3.63, 56),
	(13233, 'Otec hovorí deťom:\r\n”Tak detičky, dnes sa našej Mici narodili malé mačiatka. A čo potrebujú mačiatka, keď sú ešte maličké? Teplo. A ako vzniká teplo? Topením. Takže vezmeme mačiatka a ideme ich topiť.”              ', 238, 3.29, 56),
	(13234, 'Inseminátor odchádza z kravína, keď sa rozletia dvere a vybehne za ním krava:\r\n”Čo je, čo ešte chceš?” pýta sa jej.\r\n”Ešte pusu!”              ', 162, 4.24, 56),
	(13235, 'Leží slon vo vani. Príde k nemu \r\nblcha a hovorí:,, Hej slon, vylez!"\r\nSlon:,,Nevidíš,že sa kúpem?"\r\nBlcha:,,Slon, prosím ťa vylez." Slon konečne vyliezol a blcha mu hovorí:,,Už môžeš vliezť naspäť, chcela som len vedieť, či nemáš moje plavky."              ', 281, 4, 56),
	(13236, 'Vtrhne kohút do Pipi Grilu, chvíľku si obzerá, ako sa tam na ražňoch otáčajú kurence a zvolá:\r\n”Samozrejme, samé kolotoče, samé solária a ja na dvore nemám s kým flirtovať!”               ', 209, 3.67, 56),
	(13237, 'Vojde žaba na invalidnom vozíku do francúzskej reštaurácie a zreve:\r\n”Tak dobrú chuť!”              ', 111, 3, 56),
	(13238, 'Kohút ukazuje sliepkam pštrosie vajce a hovorí:\r\n”Vážené dámy, nechcem vás kritizovať, chcem vás však upozorniť na to, čo sa vyrába v zahraničí.”              ', 179, 3.83, 56),
	(13239, 'Rozprávajú sa dva kapre a jeden sa pýta druhého:\r\n”Veríš na život po vianociach?”              ', 106, 4.26, 56),
	(13240, 'Ide slon po ceste a pristúpi žabu. Tá vypleští oči a slon jej na to:\r\n”To zízaš, aké mám perfektné botasky.”              ', 137, 2.67, 56),
	(13241, 'Idú traja muži po púšti a nájdu veľkú jamu. Chcú zistiť aká je jama hlboká a tak hodia do nej kamienok. Keďže nič nepočuli, tak k jame dotiahli najväčší kameň aký našli. Hodili ho do jamy a zrazu za kameňom beží ovca a skočila do jamy. Onedlho stretnú pastiera:"Nevideli ste moju ovcu?"\r\n"Nie, iba jedna tu bežala a skočila do jamy." \r\n"Aha, tak to nebude moja, pretože moja bola priviazaná o kameň."              ', 446, 3.25, 56),
	(13242, 'Príde reportérka na farmu a pýta sa farmára, či by jej dokázal vysvetliť príčinu choroby šialených kráv. Farmár hovorí:\r\n- No, predstavte si, že taká krava je býkom oplodnená jedenkrát do roka.\r\n- Hmm, to je zaujímavé, ale ako to súvisí s chorobou šialených kráv?\r\nFarmár:\r\n- No, a to si ešte uvedomte, že taká krava sa dojí asi tak štyrikrát denne.\r\n- To je určite veľmi cenná informácia, ale ako je to s tou chorobou šialených kráv?\r\nFarmár:\r\n- Počkajte, práve sa dostávam k jadru problému. Len si predstavte, že by som sa hral s vašimi kozami štyrikrát za deň a pichal vás len raz do roka. Nezošaleli by ste z toho?              ', 684, 2.8, 56),
	(13243, 'Stretnú sa dve blchy. Jedna z nich je strašne premrznutá.\r\n- Čo sa ti stalo? - pýta sa jej druhá.\r\n- Ale, vošla som horárovi do fúzov, zaspala som a potom som sa zobudila na to, že horár ide na motorke a takto som premrzla.\r\nDruhá jej dáva dobrú radu:\r\n- To musíš urobiť takto. Schovaj sa nejakej žene do lona. Tam je teplúčko.\r\nO mesiac sa stretnú zase a tá druhá je totálne premrznutá.\r\n- Čo si zase vyviedla?\r\n- Nič. Urobila som to presne tak, ako si mi vtedy poradila. Schovala som sa v poštárkinom lone, zaspala som a potom som sa zobudila v horárových fúzoch na motorke...              ', 624, 3.67, 56),
	(13244, 'Stretne slon nahého muža a úplne prekvapený sa ho pýta: \r\n“Preboha, ako s týmto môžeš dýchať?!              ', 121, 3, 56),
	(13245, 'Dáma v strednom veku si kupuje papagája. Jedného si vyhliadla a hovorí mu:\r\n- Tak čo, ty malý hlupáčik, vieš rozprávať?\r\nA papagáj na to:\r\n- A čo ty, stará čarodejnica, vieš lietať?              ', 212, 3.2, 56),
	(13246, 'Ide lev po krajine a stretne korytnačku. Pýta sa jej:\r\n- Kto je pánom všetkých zvierat?\r\n- No predsa ty, lev. - odpovie so strachom korytnačka.\r\nLev ide ďalej, stretne supa a pýta sa ho:\r\n- Hej, ty vták, kto je pánom zvierat?\r\n- Ty, lev. - odpovedá sup.\r\nLev ide ďalej a všetky zvieratá mu odpovedajú rovnako, až zrazu stretne slona a pýta sa ho:\r\n- Hej, ty tlsťoch, kto je pánom zvierat?\r\nSlon sa naštve, chytí leva chobotom, zmláti ho a pustí. Lev po piatich minútach vstane a hovorí:\r\n- No, nemusíš sa hneď tak rozčuľovať, keď niečo nevieš.              ', 591, 3, 56),
	(13247, 'Malá ťava sa pýta mamy:\r\n- Mami, prečo máme na chrbte tie dva hrby?\r\n- Vieš, to keď ideme s karavánou po púšti, tak v nich máme zásobáreň vody.\r\n- Aha. A mami, prečo máme na očiach také dlhé riasy?\r\n- Vieš, to keď ideme s karavánou po púšti, tak aby nám piesok nepadal do očí.\r\n- Aha. A mami, prečo máme na konci nôh také chlpaté chumáčiky?\r\n- Vieš, to keď ideme s karavánou po púšti, tak aby sa nám nohy neborili do piesku.\r\n- Aha. A mami, nie je nám to všetko tu v ZOO na figu?              ', 535, 3.7, 56),
	(13248, 'Sedia dva kohúty na plote a nudia sa.\r\n- Nezakikiríkame si? - vraví jeden.\r\n- Nie. Poďme sa radšej do mäsiarstva pozrieť na holé sliepky.              ', 159, 3.91, 56),
	(13249, 'Dvaja kovboji, kamaráti, sa dohadujú ako si rozpoznajú svoje kone. Prvý deň jeden vraví:\r\n- Vieš čo, ja tomu svojmu odrežem chvost, a tak si ich spoznáme.\r\nNa druhý deň sa stretnú a druhý kôň je tiež bez chvosta. Prvý kovboj sa pýta kamaráta:\r\n- Ako to? Ako si ich teraz spoznáme?\r\n- No, keď môjmu koňovi sa to tak páčilo. Vieš čo, ja tomu môjmu odseknem nohu.\r\nNa tretí deň druhý kovboj kričí na prvého:\r\n- Ty si mu tiež odsekol nohu?! Ako si ich teda spoznáme?\r\n- Tak ja môjmu odseknem aj druhú nohu.\r\nNa štvrtý deň príde prvý kovboj,  obzrie si kamarátovho koňa a vraví:\r\n- Hm, ty si mu tiež odsekol aj druhú nohu. To som zvedavý, ako si ich spoznáme.\r\nDruhý vraví:\r\n- Hmm, to je blbé. Vieš čo, ja mám ohromný nápad! Ten biely bude môj a ten čierny tvoj!              ', 832, 4.21, 56),
	(13250, 'Jeden muž si vycvičil mravca. Desať rokov ho učí jesť príborom. Na záver výcviku ho ide vyskúšať do reštaurácie. Objedná dve porcie rezňa. Čašník prinesie dve porcie, ale iba jeden príbor. Muž sa ho pýta:\r\n- A ten mravec čo?\r\nČašník palcom mravca rozpučí a povie:\r\n- Prepáčte, pane.              ', 326, 3.67, 56),
	(13251, 'Myšička na lúke si vŕta jamku. Ide okolo zajačik a hovorí jej:\r\n- Myšička, netráp sa a požičaj si od krtka lopatku.\r\nMyšička ide za krtkom a keď je štyri metre od krtinca, vraví si:\r\n- Krtko je chruňo, povie mi, že mi lopatku nepožičia.\r\nIde ďalej, keď je tri metre od krtinca, hovorí si:\r\n- Ale ten krtko je naozaj strašný hlupák, on mi tú lopatku nepožičia.\r\nUž je len dva metre od krtinca a hovorí si:\r\n- Ten lakomec mi ju určite nepožičia.\r\nUž je meter od krtinca a hovorí si:\r\n- Hnusný, lakomec lakomý, nepožičia mi ju!\r\nPríde ku krtincu, zaklope a keď jej krtko otvorí, zdvihne tehlu, šmarí mu ju do hlavy a povie:\r\n- Tak si ju teda zožer!              ', 705, 3.94, 56),
	(13252, 'U zverolekára:\r\n- Pán doktor, ten môj kôň nežerie a nežerie a nežerie.\r\nLekár:\r\n- Opakujem vám to piatykrát - ten kôň vám žrať nebude a nebude a nebude, pretože je drevený a drevený a drevený!              ', 226, 3.6, 56),
	(13253, 'Príde Mara do chovproduktu kupovať papagája.\r\n- No čo, ty debil operený, vieš hovoriť? - hovorí smerom k jednému z vtákov.\r\n- Samozrejme! Ty ochechula stará! \r\n- odpovie papagáj - A ty čo, vieš lietať?              ', 230, 3.8, 56),
	(13254, 'Sliepka zniesla sedemkilové vajce. To samozrejme vzbudí záujem médií a novinári sa pýtajú kohúta:\r\n- Budete sa snažiť o ďalšie, väčšie?\r\n- Nie.\r\n- A čo plánujete.\r\n- Rozbijem pštrosovi zobák!              ', 225, 3.6, 56),
	(13255, '- Sadnú si dva slony na plot. Aký je čas?\r\n- Čas vymeniť plot.              ', 81, 3.62, 56),
	(13256, '- Je to žlté a keď to dopadne, tak to zamňauká. Čo je to?\r\n- Hocičo, ale musí to dopadnúť na mačku.              ', 124, 3.4, 56),
	(13257, '- Viete, čo preletí chrobáčikovi cez hlavu, keď narazí na predné sklo auta?\r\n- Zadoček.              ', 109, 3.63, 56),
	(13258, '- Janko, pobozkaj ma. - vraví ropucha hlúpemu Janovi.\r\n- Čo dostanem, princeznú a pol kráľovstva?\r\n- Najprv ma pobozkaj a uvidíš.\r\nJano ju pobozká a pýta sa:\r\n- Tak čo dostanem?\r\n- Ekzém, ekzém!\n', 208, 3.38, 56),
	(13259, 'Príde jedna slečna na návštevu ku kamarátke a ako tak popíjajú kávu, príde do obývačky čierna mačka a povie: "Nevideli ste tu niekde dnešné noviny?" Slečna zmätene pozerá, ale jej kamarátka ju ukľudňuje: "Nenechaj sa zmiasť, ona si akurát prezerá obrázky."              ', 295, 4, 56),
	(13260, '"Kedysi bol u nás v lese strašný bordel. Zajace žrali ďatelinu. Líšky žrali zajace. Medvede žrali, čo ich napadlo. Teraz je konečne poriadok," a hájnik sa s uspokojením zadíval na frontu zvierat s obedármi pred poľnou kuchyňou.              ', 258, 3.75, 56),
	(13261, 'Dáma v strednom veku si kupovala papagája. Jedného si vyhliadla a povedala mu: "Tak čo, ty malý hlupáčik, vieš hovoriť?"\r\nA papagáj odpovedal: "A čo ty, stará čarodejnica, vieš lietať?"              ', 214, 3.5, 56),
	(13262, 'Pýta sa jeden had druhého:\r\n- Sme jedovatí?\r\n- A prečo sa pýtaš?\r\n- Lebo som si práve zahryzol do jazyka.              ', 126, 3.25, 56),
	(13263, 'Novinári sa pýtajú sliepky, či je pravda, že zniesla sedem kilové vajce. Ona odpovedá, že áno. Tak sa jej pýtajú, aké má plány do budúcna. Ona odpovedá, že zniesť desať kilové vajce. Novinári spokojní s odpoveďou, utekajú za kohútom a pýtajú sa, či je pravda, že jedna z jeho sliepok, zniesla sedem kilové vajce. Odpovedá, že áno. Tak sa ho pýtajú, aké má plány do budúcna. On odpovedá, že rozbiť pštrosovi hubu.              ', 469, 4, 56),
	(13264, 'Sprievodca safari-parku poučuje návštevníkov:\r\n- A keby ste náhodou stretli medveďa, tak vezmite obe ruky plné hovna, hoďte mu ho medzi oči, a kým sa bude medveď utierať, zatiaľ mu zdrhnete.\r\n- Ale kde vezmeme toľko hovna?\r\n- Nebojte sa, počkajte, až sa objaví medveď...              ', 302, 4.14, 56),
	(13265, 'Sedí si hroch v bahne, prdí do vody a počíta bublinky. Pride druhý hroch a hovorí mu:\r\n- Poď so mnou dláviť žaby!\r\n- Čo ti šibe? To mám všetko nechať tak a robiť nejaké somariny?              ', 209, 3.6, 56),
	(13266, 'Letí netopier a narazí do komína. Keď sa preberie tak povie:\r\n- Doriti, ja sa raz kvôli tomu walkmanu zabijem!              ', 129, 4.11, 56),
	(13267, 'Ide Červená čiapočka lesom k babičke. Naraz ju zastaví vlk:\r\n- Červená čiapočka, ty si ale krava!\r\n- Nie som krava!\r\n- Ale si krava!\r\n- Nie som krava a nebuď sprostý, vlk!\r\n- A aj tak si krava.\r\n- A nie som.\r\n- A Červená čiapočka, kde máš košíček?\r\n- Ja som ho zabudla doma, som ja ale krava!              ', 327, 3.5, 56),
	(13268, 'Zlodej sa vlámal do bytu, prehľadával zásuvky, keď zrazu počuje hlas: „Rony ťa vidí!" Zlodej sa zľakne, obzerá sa, nikoho nevidí, tak pokračuje. Opäť sa ozve: „Rony ťa vidí!" Stále nikoho nevidí, tak začne pátrať po byte, kto to hovorí. Príde do kuchyne a zazrie papagája. „Ha, ha, ha.. obyčajný papagáj!! A ten na to: „Rony nie je papagáj, Rony je pitbull!"              ', 408, 3.92, 56),
	(13269, 'Slon vraví myške: - Pozri, aký som veľký a mocný, ako je možné, že ty si taká malá a slabá?\r\nMyška sa bráni: - Vieš, poslednom čase som bola ťažko chorá.              ', 186, 3.13, 56),
	(13270, 'Vlk šklbe sliekpu, vidí to medveď  a pýta sa ho: - Vlk, prečo šklbeš tú sliepku? Vlk odpovie: - Desať rokov manželstva, ešte som ju nahú nevidel!              ', 171, 3.33, 56),
	(13271, 'Vlk ide po lese, stretne zajaca, ten ho vyzve na súboj, že keď vyhrá, dá vlkovi desať korún a opačne, že dá vlk zajacovi. Vlk si vraví, že zajaca musí rozpučiť ako malinu, a tak vletí za ním do krovia, ozve sa rachot a buchot. Po chvíli vylezie von vlk polomŕvy, zajac vysmiaty. V tom ide okolo líška. Zajac na ňu, že si to s ňou rozdá o desať korún, a líška na to: - Figu borovú, zase nemáte s medveďom za čo chlastať, čo?"              ', 473, 4.15, 56),
	(13272, 'Medveď sa rozhodne emigrovať do Nemecka. Ide teda k hraniciam a stretne zajaca. Zajac sa ho pýta, kam ide a medveď mu povie, že do Nemecka. \r\n"Medveď, vezmi ma so sebou," prehovára ho zajac. \r\nMedveď súhlasí a strčí si zajaca do vrecka. Príde k hraniciam a colník sa ho pýta, kam ide. \r\n"Za kámošom do Nemecka," odpovie medveď. \r\n"A čo to máš vo vrecku?" pýta sa colník. Medveď sa buchne po vrecku a hovorí: \r\n"Aaale, to je len fotka zajaca..."              ', 483, 4, 56),
	(13273, 'Bavia sa dva psy: \r\n„Tak čo, ako tá ekonomická reforma pôsobí na tvoj život a životnú úroveň?" \r\n„Ále, ani sa nepýtaj, skrátili mi reťaz." \r\n„Aspoň nemusíš behať toľko dokoola."\r\n„No, to je síce fakt, ale misku so žrádlom mi nechali tam, kde predtým."              ', 296, 3.64, 56),
	(13274, 'Prídu dve krysy do predajne s televízormi. Predavač: \r\n“Tak čo, akú, milé zákazníčky, čiernobielu alebo farebnú?” Krysy: \r\n”To je jedno, hlavne, aby mala veľa kanálov.”               ', 204, 3, 56),
	(13275, 'Stretnú sa dve myši: \r\n„Ty, predstav si, mám nového priateľa, tu mám jeho fotku.” \r\n„Veď to je netopier!” \r\n”No mňa presviedčal, že je pilot.”\n', 165, 3.8, 56),
	(13276, 'Vlkovi sa narodil syn. Keď mu ho v pôrodnici ukazovali, vlk sa priamo rozplýval: \r\nTo je krásne dieťatko, tie očičká, to som celý ja! A ten ňufáčik tiež! A tie uši... tie uši... TIE UŠI! No, počkaj, ZAJAC!!!              ', 238, 3.67, 56),
	(13277, 'Ide prasiatko okolo zástrčky a hovorí:\r\n- Bratku, teba tu zamurovali?              ', 86, 3, 56),
	(13278, 'Slimáky hrajú karty a minú sa im cigarety. Pošlú jedného z nich, aby ich šiel kúpiť. Čakajú jednu ... tri ... šesť hodín, keď sa slimák konečne vracia, už z diaľky volá: \r\n“Chcete s filtrom alebo bez?”\n', 226, 2.4, 56),
	(13279, 'Mladšia myš sa pýta staršej:\r\n"Ty počúvaj, čo je to ta otrava na myši?"\r\nStaršia odpovedá:\r\n"Vieš, to je niečo také ako mačka v prášku!"              ', 166, 3.17, 56),
	(13280, 'Zvieratká sa pýtajú slimáka, ktorý ma celú ulitu obviazanú obvezom, čo sa mu stalo. Slimák odpovedá:\r\n"No pečiem si to tak po lúke a nevyrastie predomnou púpava?"              ', 189, 3.38, 56),
	(13281, 'Medveď, vlk, líška a zajac idú hrať karty. Medveď rozdáva a vraví:\r\n"Nie že budete podvádzať, lebo vám roztrepem tú ryšavú papuľu."              ', 161, 3.88, 56),
	(13282, 'Ide rodinka ľadových medveďov po ľadovej kryhe. \r\nMalý sa pýta: \r\n- Mami, a ty si bola vždy ľadový medveď?\r\n- Áno, synček.\r\nZa chvíľu: \r\n- Oco, a ty si bol vždy ľadový medveď?\r\n- Áno, synček.\r\nMalý sa na chvíľu zamyslí a potom sa pýta:\r\n- Doriti, ale prečo mi je potom taká zima???              ', 322, 3.22, 56),
	(13283, 'Zajac urobí megapárty v lese a pozve všetky zvieratá. Prišli všetci, len stonožka chýba. Zábava je v plnom prúde, pomaly už aj končí, keď sa vovalí stonožka a začne nadávať: \r\n- Doriti, všetko som zmeškala! Ktorý idiot napísal na dvere "Utierajte si nohy!"?              ', 294, 3.67, 56),
	(13284, 'Inzerát:\r\nPredám psa, žerie všetko.\r\nPozn.: Má rád deti.              ', 76, 3.4, 56),
	(13285, 'Mamut spýtavo k mamutici:\r\n"Hmmmmmmm?"\r\nOna mu zamietavo:\r\n"M-uu."\r\nOn túžobnejšie:\r\n"Hmmmmmmmmmmmm?"\r\nOna zase zamietavo:\r\n"M-u!"\r\nMamut:\r\n"Neblni! Chceš, aby sme vymreli?"              ', 192, 3.91, 56),
	(13286, 'Letí orol a cíti, že mu niekto sadol na chrbát. Obzrie sa a vidí, že je to malý vrabec. No dobre, myslí si orol, možno je unavený. Za pár minút pozrie opäť a vidí, ako si vrabec vytiahol vodku, zapálil si cigaretu a pozerá si časopis. Orol prekvapene pozerá na vrabca a vrabec mu hovorí:\r\n"Čo čumíš, ty idiot, sleduj cestu!"              ', 362, 3.4, 56),
	(13287, 'Stonožka samček a stonožka samička si dohodnú rande v parku. Stretnú sa, a on ju pobozká a potom ju chytí za ruku, za ruku, za ruku...              ', 156, 4.1, 56),
	(13288, 'Idú tri mravce po púšti a už-už by zomreli od smädu, keď zrazu zomreli od hladu.              ', 101, 4, 56),
	(13289, 'Príde medvedík do brlohu a vraví druhému medvedíkovi:\r\n"Dostali sme desať pohárikov medu. Rozdelil som ich spravodlivo, tebe osem a mne osem."\r\n"Počkaj, počkaj, ale veď osem a osem nie je desať!"\r\n"To je jedno, ja už som si svojich osem pohárikov zjedol."              ', 282, 4.1, 56),
	(13290, 'Sedí veverička na strome a havká mňau mňau aký som ja pekný medveď.              ', 89, 3.2, 56),
	(13291, 'Stratil sa pes.\r\nZvláštne znamenia: vypichnuté pravé oko, natrhnuté ľavé ucho, zlomená pravá zadná labka, odrený chrbát. Počúva na meno Lucky.              ', 170, 3.75, 56),
	(13292, 'Idú dva medvede po lese, jeden hnedý a druhý do ľava.              ', 71, 3.36, 56),
	(13293, 'Scéna: Austrália\r\nPo púšti skáče klokan. Po pár skokoch sa mu z vaku vykloní malý zelený tučniak a hodí šialenú tyčku. A takto dookola...\r\nScéna: Antarktída\r\nNa snehu stojí tučniak. K nemu sa túli malý premrznutý trasúci sa klokan a takto si hovorí: \r\n"Zasrané výmenné pobyty."              ', 318, 3.8, 56),
	(13294, 'Policajný pes utečie do lesa a skamaráti sa s vlkom. Hneď na druhý deň sa však obaja chytia do pasce. Vlk hovorí psovi:\r\n- Budeme si musieť odhryznúť nohu, inak nás to nepustí.\r\nVlk tak hneď urobil, odbehol a čakal na psa. Ten neprichádzal. Ide sa naňho pozrieť k pasci a pýta sa ho:\r\n- Čo tu ešte robíš?\r\nPolicajný pes odpovedá:\r\n- Ale, už som si odhryzol tri nohy a stále mi to drží.              ', 428, 4, 56),
	(13295, 'Rúti sa slimák celou rýchlosťou cez les a zrazu pred ním vyrastie huba.              ', 90, 3.63, 56),
	(13296, 'Farmár hovorí žene:\r\n"Dve z našich sliepok už neponesú vajcia."\r\n"Áno? A ako to vieš?"\r\n"Pred chvíľou som ich prešiel traktorom."\n', 141, 3.17, 56),
	(13297, 'Sedliak prijíma nového kočiša:\r\n"A rozumiete koňom?"\r\n"Prečo? Niečo hovorili?"\n', 86, 4, 56),
	(13298, 'Chcete mať zdravých psov?\r\nKupujte im Pedigree Pal!\r\nChcete mať zdravé mačky?\r\nKupujte im Whiskas!\r\nChcete byť zdraví?\r\nJedzte psov a mačky!\n', 149, 4.2, 56),
	(13299, 'Na vedení visia netopiere dole hlavou a z ničoho nič sa \r\njeden prudko otočí a zostane hlavou hore.\r\n"Čo sa mu stalo?" pýta sa jeden.\r\n"Neviem, asi odpadol."\n', 165, 2.75, 56),
	(13300, 'Príde zajac do kupé vo vlaku a hovorí:\r\n"Je medzi vami nejaký frajer?!"\r\nNikto nič, tak zajac hovorí:\r\n"Tak mi všetci dáte korunu."\r\nIde do druhého kupé a hovorí:\r\n"Je tu nejaký frajer?!?"\r\nJeden chlap vstane a suverénne povie:\r\n"Ja!"\r\nA za zajacom sa objaví medveď a hovorí:\r\n"Tak frajer to má za desať a ostatní po korune..."\n', 347, 3.75, 56),
	(13301, '"Pane, vás jazvečík ma kusol do nohy!"\r\n"A čo? Chcete snáď, aby vás taký malý pes kusol do oka?"\n', 106, 3.71, 56),
	(13302, 'Viete, čo vznikne, keď had zje pol kila klincov?\r\nOstnatý drôt!\n', 68, 3.88, 56),
	(13303, 'Zajac si kúpi motorku a ide po lúke. Stretne medveďa:\r\n"Kde si vzal peniaze na motorku, zajac?" \r\n"Keby si medveď furt nechlastal a šetril, mal by si ju tiež!"\r\nO týždeň zasa ide zajac po lúke a vidí medveďa ako ide v aute:\r\n"Medveď, kde si ty, prosím ťa, vzal na auto?"\r\n"Stačilo len vrátiť prázdne fľaše!"\n', 329, 3.8, 56),
	(13304, 'Príde chlap do obchodu a chce papagája. Majú na výber troch,\r\nza 1000, 2000 a za 6000. Chlap sa pýta predavača:\r\n"Prečo sú ceny rozdielne, keď vyzerajú rovnako?"\r\n"No, ten za 1000 hovorí po španielsky a ten za 2000 to vie preložiť do slovenčiny."\r\n"No a čo ten za 6000?"\r\n"To nevieme, ale tí dvaja mu hovoria šéfe." \n', 336, 2.67, 56),
	(13305, 'Viete, čo musíte urobiť, keď stretnete hladného medveďa v Tatrách?\r\nNemusíte robiť nič, medveď urobí všetko za vás.\n', 130, 3.33, 56),
	(13306, 'Ide chlap ráno do práce. Vyjde pred dvere a na chodníku vidí slimáka. Má zlú náladu, tak toho slimáka odkopne do kríkov. \r\nO pár mesiacov neskôr niekto klope, tak chlapík ide otvoriť. Na prahu stojí slimák a nasrato hovorí:\r\n"To čo bolo vtedy??!"\n', 265, 3.63, 56),
	(13307, 'Stretne lev supa a pýta sa:\r\n"Ty vták vyplznutý, kto je kráľom zvierat?"\r\n"Ty lev."\r\nLev ide ďalej a stretne slona:\r\n"Hej, ty smrad ušatý, kto je kráľom zvierat?"\r\nSlon sa naštve, chytí leva chobotom a začne ho trieskať o zem. \r\nLev po piatich minútach vstane a hovorí:\r\n"No nemusíš sa hneď tak rozčuľovať, keď niečo nevieš."\n', 351, 4, 56),
	(13308, 'Sedí zajac na strome a robí si manikúru. Ide okolo líška a pýta sa, čo robí.\r\n"Brúsim si pazúry na medveďa."\r\nIde okolo vlk:\r\n"Zajac, čo robíš?"\r\n"Brúsim si pazúry na medveďa."\r\nIde okolo medveď a pýta sa:\r\n"Zajac, čo robíš?"\r\n"Ale, brúsim si pazúry a kecám a kecám."\n', 294, 2.55, 56),
	(13309, 'Viete, prečo má bocian dlhé nohy?\r\nAby ho žaby nemohli kopať do zadku.\n', 76, 4, 56),
	(13310, 'Medveď má vypracovaný zoznam zvieratiek, ktoré zožerie. Príde líška:\r\n"Medveď, máš ma na zozname?"\r\n"Mám."\r\n"A zožerieš ma?"\r\n"Zožeriem."\r\nMedveď zožral líšku a príde zajac:\r\n"Medveď, máš ma na zozname?"\r\n"Mám."\r\n"A nemohol by si ma vyškrtnúť?"\r\n"Mohol."\n', 282, 3.63, 56),
	(13311, 'Sova hovorí na sneme zvieratiek:\r\n"Nedá sa nič robiť, ale jedno zelené zviera bude musieť preč z lesa!"\r\nZ pod lopúchu vylezie žaba a vraví:\r\n"Chudák krokodíl."\n', 173, 3.7, 56),
	(13312, 'Pred novým obchodom v lese stojí dlhá fronta zvieratiek. Príde zajac a vocpe sa až dopredu. Vidí ho medveď a kričí:\r\n"Nebudeš sa predbiehať!" a zahodí ho preč.\r\nZajac vstane a ide znova dopredu. Zas ho medveď vidí, vynadá mu, chytí ho a zahodí preč. Zajac sa zdvihne, opráši a hovorí:\r\n"Do hája, ja snáď dnes neotvorím!"\n', 347, 4.11, 56),
	(13313, 'Stretnú sa dve dážďovky a jedna hovorí:\r\n"Kde máš starého?"\r\n"Ale, chalani ho vytiahli na ryby..."\n', 107, 3, 56),
	(13314, 'Rybár chytí rybu a tá mu hovorí:\r\n"Keď ma pustíš, splním ti tri priania."\r\nRybár len čumí a než sa spamätá, vykukne z vody iná ryba a vraví:\r\n"Nepúšťaj ju, kecá."\n', 183, 3.8, 56),
	(13315, 'O čom premýšľa blcha, keď skáče z jednej polky rite na druhú?\r\n"Hm, keď nedoskočím, tak som v..."\n', 109, 3.93, 56),
	(13316, '"Martin, ako to robíš, že tvoji poštoví holuby na závodoch vždy zvíťazia?"\r\n"Skrížil som ich s papagájmi, takže keď zablúdia, vedia sa spýtať na cestu!"\n', 170, 3.2, 56),
	(13317, '"Haló, volám ohľadne toho strážneho psa, čo sme od vás kúpili. Môžete nám poradiť, ako máme zariadiť, aby nás pustil domov?"\n', 140, 3, 56),
	(13318, '"Tak čo, ako ide práca?"\r\n"Ale, zase ma vyhodili."\r\n"A čo si vlastne robil?"\r\n"Krmiča v ZOO."\r\n"A prečo ťa vyhodili?"\r\n"Utiekli mi korytnačky..."\r\n"Ako je to možné?"\r\n"No niesol som im jedlo, položím kýble, otvorím klietku a frrrnk, frrrrnk. A korytnačky boli v prdeli..."\n', 287, 2.86, 56),
	(13319, 'Na polícii zvoní telefón:\r\n"Volám od Novákovcov. Prosím, okamžite sem niekoho pošlite. Práve vliezla do bytu mačka!"\r\n"Počujte, nerobte si z nás srandu!!!"\r\n"Musíte sem niekoho poslať. Pri telefóne je Novákov papagáj!"\n', 236, 2.75, 56),
	(13320, 'Čo vznikne skrížením kravy a korytnačky?\r\nTeľa s prilbou!\n', 64, 3.58, 56),
	(13321, 'Pani, kde má ten váš psíček hlavičku?\r\nPrečo, chcete mu dať cukríček?\r\nNie! Chcem ho kopnúť do riti!!!\n', 115, 4.16, 56),
	(13322, 'Džunglou kráča huslista a zrazu sa pred ním objaví lev. Huslista začne hrať, lev sa započúva a zaspí. \r\nZa chvíľu sa objaví tiger, chlap pokojne začne hrať.\r\nLenže tiger sa naň vrhne a zakusne ho. Ide okolo lev a pýta sa:\r\n"Nie je ho škoda? Tak krásne vedel hrať..."\r\n"Hovoríš dačo? Zle počujem!"\n', 322, 3.56, 56),
	(13323, 'Ide pes po púšti a hovorí: \r\nKeď nenájdem strom, tak sa asi počurám.               ', 90, 3.5, 56),
	(13324, 'Mladý zajac stojí pred zrkadlom, čistí si tvár. Stará zajačica sa ho pýta:\r\n- Vyrážky, vyrážky...?\r\n- Nie, broky !              ', 140, 3.33, 56),
	(13325, 'Ako spoznáme lietajúceho zajaca?\r\nNa chrbte má orla.              ', 69, 3.75, 56),
	(13326, 'Dva opité hady vychádzajú z krčmy a jeden sa pýta: \r\n- Počúvaj, my sme jedovaté hady?\r\n- Jasné!\r\n- Tak to som skončil, zahryzol som si do jazyka!              ', 169, 3, 56),
	(13327, 'Netopier pri lete narazí do stromu. Otrepe sa,letí ďalej, narazí do komína, otrepe sa, trafí kandeláber. Sedí a nadáva:\r\n- Raz sa s tým walkmanom zabijem!              ', 178, 2.67, 56),
	(13328, 'Holúbätká sa vykakali do hniezda. Matka na ne kričí: \r\n"Kedy sa už konečne naučíte používať pomník?"               ', 128, 3, 56),
	(13329, 'Štyri potkany v elektre: \r\n"Chceme televízor, ale taký, čo ma strašne veľa kanálov!!!"              ', 107, 4, 56),
	(13330, 'Mravce sa bijú so slonom...\r\nSlon sa otrasie, všetky mravce spadnú, iba jeden mu ostane visieť na krku... Mravce, ktoré už spadli naňho kričia zaškrť ho...........              ', 187, 3.29, 56),
	(13331, 'Na svojom pravidelnom lete stretne jedna staršia mucha druhú, ktorá robí chaotické neusporiadané pohyby.\r\n„Biolit?“ pýta sa.\r\n„Nie. Heavy Metal.“ odpovedá tá druhá. \n', 184, 4.21, 56),
	(13332, 'Keď slimák prechádzal cez cestu, prešla ho korytnačka. Keď sa v nemocnici prebral, opýtali sa ho, ako k nehode došlo.\r\n- Nespomínam si. - odpovedal slimák. \r\n- Zbehlo sa to všetko tak rýchlo.\n', 204, 2.67, 56),
	(13333, 'Klope slimák medveďovi na dvere. Medveď otvorí, kopne do slimáka, ten odletí a medveď zavrie dvere. Po štyroch rokoch sa slimák doplazí späť k medveďovým dverám, zaklope, medveď otvorí a slimák na neho vyblafne:\r\n- Áaaa, toto čo malo znamenať!\n', 265, 2.86, 56),
	(13334, 'Na kopci sa jež napcháva jablkami. Priletí bocian a pýta sa:\r\n- Čo ješ?\r\n- Čo bocian?\r\nBocian sa zamyslí a pýta sa:\r\n- Čo ješ, jež?\r\n- Čo, bocian bocian?              ', 180, 3.64, 56),
	(13335, 'Sedí prasiatko na borovici a je čerešne. Ide okolo medveď a pýta sa:\r\n- Čo robíš prasiatko?\r\n- Jem čerešne.\r\n- A nehovor, čerešne na borovici, nebuď hlúpučký.\r\n- Doniesol som si.              ', 208, 2.86, 56),
	(13336, 'Rozprávajú sa dva zajace v lese:\r\n- Dávaj si pozor, dnes je poľovačka!\r\n- No a čo? Veď všetci poľovníci sa aj tak opijú a nič netrafia.\r\n- Však áno, ale už ma dvaja ovracali!\n', 190, 3.11, 56),
	(13337, 'Nahnevaný zajac príde za medveďom s brokovnicou a vraví:\r\n„Medveď, zožer to lajno, čo leží na ceste, lebo ťa zastrelím.“\r\n„Nezožeriem.“\r\nZajac teda stlačí spúšť a brokovnica klapne naprázdno. Pokrčí plecami a povie:\r\n„Keď nechceš ty, dám si ja...“ \n', 284, 3.97, 56),
	(13338, 'Stonožka-samička a stonožka-samček si dohodnú rande v parku. Stretnú sa, on ju pobozká a potom ju chytí za ruku, za ruku, za ruku, za ruku, za ruku...              ', 172, 3.17, 56),
	(13339, 'Myš a slon prídu na úrad, aby ich zosobášili. Starosta sa ich pýta, prečo sa berú. Myška na to: "Keď musíme..."              ', 136, 2.67, 56),
	(13340, 'Lev - kráľ zvierat - si zavolá všetky zvieratká a povie im:\r\n- Všetky pekné zvieratká sa postavia na pravú stranu a všetky múdre zvieratká na ľavú stranu.\r\nA ozve sa žaba:\r\n- A ja sa mám roztrhnúť alebo čo?                ', 241, 3.5, 56),
	(13341, 'Tri potkany sa chvália, ktorí z nich je drsnejší. Prvý vraví:\r\n- Ja, keď chcem urobiť dojem na nejakú samicu, prebehnem cez kuchyňu, práve keď tam celá rodina obeduje.\r\n- To je nič. - vraví druhý. - Ja ju dovediem k pasci, jednou rukou zdvihnem drôt a druhou jej podám syr.\r\nVidia, že tretí je na odchode a pýtajú sa ho:\r\n- Sme oproti tebe veľkí drsňáci, čo?\r\n- Nie, len idem akurát pretiahnuť mačku.\n', 431, 4.21, 56),
	(13342, 'Idú dva medvede. Jeden hnedý a druhý doprava.              ', 62, 3.43, 56),
	(13343, 'Winetoua naháňajú skinheadi. Winetou im úspešne uniká z kontinentu na kontinent, až príde k Viktóriným vodopádom a tam sedí žaba. Pýta sa Winetou žaby:\r\n- Žaba, prečo si taká zelená?\r\n- Lebo jem mentolové cukríky!              ', 248, 3.58, 56),
	(13344, 'Príde kohút do pôrodnice a sestrička vraví: \r\n- Blahoželám, je to vajce              ', 92, 3.6, 56),
	(13345, 'Dvaja ježkovia sa rozprávajú:\r\n-Hej, čo si robil keď máš obviazanú labku?\r\n-Ále,chcel som sa len poškrabkať.              ', 133, 4.14, 56),
	(13346, 'Jedného dňa krtko potreboval lopatu, a tak sa rozhodol, že si ju ide požičať od prasiatka. Keď si už tak ide vduchu si hovorí. Prasiatko je dobrý kamarát určite mi požičia tú lopatku. Ide ďalej a zase si v duchu hovorí. No neviem či mi prasiatko požičia tú lopatku. O chvýlu si zase hovorí. Prasiatko mi určite nepožičia lopatku. Keď príde k domu prasiatka, zaklope. Prasiatko otvorí a krtko mu hovorí. Serem ti na tú lopatu!!!              ', 472, 4.22, 56),
	(13347, 'Slon a slonica sa prechádzajú. Majú zamilovane stočené choboty. Odrazu slonica zastane a povie:\r\n”Počuj, dúfam, že ma nevodíš za nos!”              ', 162, 3.86, 56),
	(13348, 'Ježko sa ožení s balónom. Príde svadobná noc, ježko sa pritúli k balónu a nežne zašepká:\r\n”Milujem ťa!”\r\nBalón na to:\r\n”Pfffffff!”              ', 166, 3.63, 56),
	(13349, '\r\nIdú tri korytnačky po púšti, sú strašne smädné, idú rok, dva,... Po 5 rokoch vidia v diaľke pohár. Prídu celé natešené k poháru, tešia sa, že sa napijú, ale pohár je prázdny. Nechajú pohár tak a vydajú sa na ďalšiu púť za vodou. Po ďalších 5 rokoch prídu do oázy, chcú sa napiť, ale nemajú pohárik. Premýšľajú, čo s tým urobia, až jednu z nich napadne:\r\n- Jedna z nás sa vráti po pohárik. \r\nVyberú jednu z nich, a korytnačka vraví: \r\n- Dobre, ja pôjdem, ale vy mi musíte sľúbiť, že sa nenapijete, kým budem preč. Korytnačky súhlasili a dohodli sa, že počkajú. Čakajú 5 rokov a hovoria si: \r\n- No, už by mohla byť pri pohári a pomaly by mohla ísť späť. \r\nPo ďalších 5 rokoch si hovoria: \r\n- No, už by tu mohla byť, ale počkáme ešte chvíľku. \r\nPočkajú teda ešte dva roky, ale potom je už ten smäd taký neznesiteľný, že si hovoria: \r\n- Napime sa, veď ona to aj tak nezistí. Ak sa nenapijeme, zahynieme, ako možno zahynula aj naša kamarátka. \r\nPrídu k pramienku, chcú sa napiť, keď sa z krovia ozve hlas tretej korytnačky: \r\n- Vááážené! Pokiaľ si nebudeme dôverovať, ja po ten pohárik nepôjdem...              ', 1219, 3.67, 56),
	(13350, 'Ide zajac po lese a stretne na mol sťatého medveďa. Rozhodne sa teda, že využije túto situáciu a poriadne medveďa zmláti. Na druhý deň sa medveď vyberie za kráľom zvierat - levom, podať sťažnosť na neznámeho páchateľa. Lev zvolá všetky zvieratá a zaháji vyšetrovanie. Pýta sa teda medveďa:\r\n"Medveď, čo si pamätáš zo včerajška?"\r\n"Nepamätám si toho veľa, ale som si istý, že ten bitkár mal na hlave niečo dlhé..."\r\nZajac sa v zástupe nakloní k slimákovi a hovorí: \r\n"Ale ti prihára, čo, ty hajzel!"              ', 561, 4.04, 56),
	(13351, 'Príde zajačik do cukrárne a hovorí: \r\n"Máte mrkvovú zmrzlinu?"\r\nPredavačka mu odpovie: \r\n"Nie, nemáme."\r\nPríde druhý deň a pýta sa: \r\n"Máte mrkvovú zmrzlinu?"\r\nPredavačka mu zase odpovie: \r\n"Nie, nemáme"\r\nTak ide predavačka za riaditeľom a povie mu: \r\n"Pán riaditeľ, urobme tomu zajačikovi radosť a objednajme mu mrkvovú zmrzlinu."\r\nPríde zajačik na tretí deň do cukrárne a spýta sa: \r\n"Máte mrkvovú zmrzlinu?"\r\nPredavačka mu radostne odpovie: \r\n"Máme, zajačik, máme."\r\nZajačik na to: \r\n"Tá je pekne hnusná, že?"              ', 565, 3.7, 56),
	(13352, 'Zvieratká v lese sa dohodnú, že prestanú znečisťovať les. Rozhodnú sa postaviť si kadibúdku. Hneď prvý deň je však kadibúdka poškodená a má vylomené dvere. Zvolajú snem, aby zistili, kto to urobil. Zajac sa prihlási a povie: \r\n"To urobil medveď, ja som to videl, ja som pri tom bol." \r\n"Ako to, že si pri tom bol?" \r\n"No šiel som okolo a v kadibúdke bol medveď. Zavolal na mňa, či plznem. Povedal som mu, že nie, a on si so mnou vytrel zadok." Zvieratká kadibúdku opravia, ale hneď na druhý deň je zase nejaká rozlámaná. Zvolajú teda zase snem, aby zistili, kto to urobil. Prihlási sa líška a povie: \r\n"To urobil medveď, ja som to videla, ja som pri tom bola." \r\n"Ako to, že si pri tom bola?" \r\n"No išla som okolo a v kadibúdke bol medveď. Zavolal na mňa, či plznem. Povedala som mu, že nie, a on si so mnou vytrel zadok." \r\nTretí deň je kadibúdka rozbitá, tentoraz úplne na mraky. Znovu preto zvolajú snem. Prihlási sa ježko a povie: \r\n"To urobil medveď..."              ', 1030, 4.1, 56),
	(13353, 'Sedia tri netopiere na strome. Vtom sa jeden vznesie, odletí a za chvíľu sa vráti celý zakrvavený. Netopiere sa ho pýtajú, kde bol. Odpovedá:\r\n"Vidíte tamten dom? Tak tam je taká rodina a ja som ju celú vycucal." \r\nZa chvíľu sa zdvihne druhý netopier, odletí a za chvíľu sa vráti ešte zakrvavenejší než ten prvý. Ostatní sa ho pýtajú: \r\n"Počuj, ty, kde si bol? " \r\nOn na to: \r\n"Vidíte tamtú ohradu? Tak tam je stádo kráv a ja som ho celé vycucal." \r\nChvíľu nato sa zdvihne tretí, odletí a za chvíľu sa vráti  zakrvavený skrz-naskrz. Tí ostatní sa hneď pýtajú: \r\n"No, a kde si bol ty?" \r\nA on nato: \r\n"Vidíte tamtú vysokú vežu? Tak tú som si nevšimol."              ', 717, 3.85, 56),
	(13354, 'Lev leží v jaskyni a beží okolo zajac: \r\n„Zastav, ty zbabelec jeden ušatý a povedz, kto je kráľ púšte”. \r\n„Ty,” povie zajac. Tak ho pustí. Za chvíľku beží okolo gazela a lev zase: \r\n„Zastav, ty potvora skákavá a povedz, kto je kráľ púšte.” \r\n„Ty,” a zase ju pustí. Ide okolo slon a lev na neho: \r\n„Povedz, ty tučniak ušatý, kto je kráľ púšte.” \r\nSlon ho vzal chobotom, zatiahol ho do krovia. V kroví bol strašný rachot a lev sa ledva vytackal so slovami: \r\n„Nemusíš sa hneď byť keď niečo nevieš.”               ', 574, 3, 56),
	(13355, 'Zvieratká v lese majú vojenský odvod a tak prizvú aj medveďa. Medveď ide, ide, smutne kuká a zrazu stretne lišiaka. Lišiak sa usmieva a reve na celý les: \r\n- Nevzali ma na vojnu! \r\nMedveď sa ho pýta: \r\n- A čo ti je, že ťa nevzali? \r\n- Ale, to vieš, niečo pre to urobiť musíš, ja som si obrúsil vajcia o strom. \r\nMedveď ide ďalej a po ceste si vraví, že toto predsa kvôli tomu robiť nebude. Stretne vlka, ktorého tiež nevzali a má z toho strašnú radosť. \r\n- Čo si ty urobil, vlk? \r\n- Ale, obrúsil som si vajcia o strom. \r\nMedveď sa diví, že im to za to stojí. Ide ďalej a stretne zajaca. A aj on si obrúsil vajcia o strom. Medveď si vraví, že keď to urobili ostatní, tak to tiež teda urobí. Príde k najdrsnejšiemu stromu a hrozne, až do krvi si ich odrie. Potom ide k odvodnej komisii a bolesťou narieka, kde mu hneď od dverí vravia: \r\n- Medveď, ty sem ani nechoď, teba poznáme, ty máš ploché nohy.              ', 971, 4.1, 56),
	(13356, 'Pýta sa malé ťaviatko mamy ťavy: „Mami, prečo máme na nohách kopýtka?“ \r\n„Pretože chodíme po púšti, plnej ostrého piesku, ktorý by nám poranil nohy.“\r\n„Maminka, a prečo máme na nohách tvrdú kožu a srsť?“ „No pretože, keď prídeme do oázy, je tam tŕnie a chrastie a to by nás poškriabalo.“\r\n„A maminka, prečo máme na chrbte hrby?“\r\n„Lebo voda na púšti je veľmi zriedkavá, a tak si v nich nosíme zásoby.“\r\n„Mami, a  môžem sa  ťa ešte na niečo spýtať?“ \r\n„Samozrejme, ty môj zvedavec.“\r\n„A načo nám je to všetko tu v ZOO  Bojnice?“               ', 625, 4, 56),
	(13357, 'Príde chlapík s opicou na pleci do baru a objedná si vodku. Keď vypije, opica rozbíja poháre, skočí k baru, porozbíja fľaše, zrazu odskočí na biliardový stôl, zbadá biliardovú guľu a zožerie ju. Všetci sa čudujú, ale jej majiteľ hovorí: \r\n„Vždy takto vyvádza keď si vypijem. Všetku škodu zaplatím." \r\nPrídu o týždeň a chlapík si znova objedná vodku. Keď si vypije, opica znova začne skákať po stoloch, v bare rozbíjať poháre a fľaše. Zrazu priskočí k stolu, kde sú v miske čerešne, zoberie si jednu, prezerá si ju zo všetkých strán, strčí ju do zadku a potom ju zhltne. Nikto nechápe a pýtajú sa ho, prečo si ju strčila do zadku. A na to majiteľ odpovie: \r\n"No viete, odvtedy, čo zjedla tú biliardovú guľu, radšej si všetko najprv odmeria."               ', 825, 4.08, 56),
	(13358, 'Vlk a zajac si kúpili auto. Po dvoch dňoch si ho každý z nich chce zobrať k sebe. Tak sa dohodnú,že auto dostane ten, ktorý si prvý nebude musieť odskočiť na záchod. Najprv šoféruje auto vlk. Ide 100 km za hodinu a pýta sa:\r\n"Už si musíš odskočiť na záchod?" \r\nZajac povie:\r\n"Nie!"\r\nVlk ide stále rýchlejšie a rýchlejšie, ale zajac si ešte stále nemusí odskočiť. Zajac navrhne, aby si to vymenili. Teraz šoféruje zajac. Ide 100 km za hodinu a pýta sa :\r\n"Už si musíš odskočiť?"\r\nVlk pokrúti hlavou. Zajac ide stále rýchlejšie, ale ešte stále nič. Nakoniec ide 250 km za hod. a pýta sa :\r\n"Už si musíš odskočiť?"\r\nVlk pokrúti hlavou. Zajac potom povie:\r\n"Teraz si nemusíš odskočiť, ale kebyže si vedel, že nedočiahnem na brzdy, tak by si sa aj posral!"              ', 826, 3.78, 56),
	(13359, 'Mamut pije vodu z válova. Zrazu pribehnú slony a zbijú ho chobotmi, dokopú ho... a odbehnú.\r\nKeď sa mamut preberie, zastoná: "posratí skíni"              ', 163, 3.82, 56),
	(13360, 'Jedného krásneho slnečného dňa lezie na strom korytnačka. Trvá jej to asi tak hodinu. Keď je už hore, odrazí sa a začne mávať ručičkami. Po dopade na zem sa opráši a ide to skúsiť znovu. Druhýkrát jej to trvá už asi tak 2 hodiny. Vylezie na ten istý konár stromu a odrazí sa. Zákon gravitačnej sily sa opakuje a pancier to zasa vydržal. Teraz ju to však poriadne naserie. Tretíkrát sa výstup na strom predĺžil na 3 hodiny (však už si dosť ublížila). So silami, ktoré jej ešte ostali, sa teraz poriadne odrazí a začne mávať ručičkami aj nožičkami. Tvrdý náraz sa opäť zopakuje. Na vedľajšom strome sedia dve vrany a tá jedna hovorí tej druhej: \r\n"Miláčik, predsa sme jej len mali povedať, že je adoptovaná."\n', 770, 3.27, 56),
	(13361, 'Kde bolo, tam bolo, v ďalekej zemi žila krásna sebavedomá princezná. Keď raz meditovala na brehu rybníka pri svojom zámku, skočila jej do lona žaba a hovorí:\r\n"Krásna dáma, kedysi som bol krásnym princom, ale zaklial ma zlý čarodejník. Stačí jediný tvoj bozk a opäť sa zo mňa stane elegantný muž. A potom, moja drahá, môžeme sa vziať a založiť na tvojom zámku, s mojou matkou domácnosť. Budeš mi smieť pripravovať pokrmy, prať moje šaty, rodiť mi deti a budeš mi do smrti vďačná, že môžeš takto žiť." \r\nV ten večer si pri vychutnávaní mierne opražených žabích stehienok vo vínovej omáčke princezná pomyslela:\r\n"Tak to určite."              ', 702, 3.83, 56),
	(13362, 'Kde bolo, tam bolo, bol jeden les a v ňom zvieratká strašne chľastali, fajčili a vôbec viedli zhýralý život. Pod vplyvom jedného múdreho kazateľa sa však dohodli, že s tou Sodomou a Gomorou skončia. Kontrolou dodržiavania pravidiel bohabojného života, poverili medveďa. Hneď prvý deň ide medveď na kontrolu. Všade pokoj, až naraz nájde zajaca ožratého ako doga. Karhá ho:\r\n- Zajac! Dohovorili sme sa, že nebudeme chľastať a ty chľastáš ďalej!!\r\n- Prepáč, medveď, ja som sa to dozvedel nejako neskoro. Začínam až zajtra.\r\nNa ďalší deň sa zajac zase musel ospravedlňovať:\r\n- Prepáč, medveď, ja som len vrátil fľašky. Toto je môj posledný chľast.\r\nNa tretí deň medveď kontroluje les a všetko je v poriadku. Všetci sa slušne zabávajú, nikde ani stopa po alkohole a cigaretách. Len zajac niekde zmizol. No keď išiel okolo potoka všimol si nejaký podozrivý rákos. Tak ho  vytiahol a s ním aj zajaca, ktorý schovaný pod vodou, cez ten rákos dýchal. Samozrejme, bol ožratý ako  cársky dôstojník.\r\n- Zajac, už ma neser!! Všetky zvieratká sme sa dohovorili, že nebudeme chľastať a ty si zase ožratý!!\r\n- Vieš, medveď, to  čo ste si vy zvieratká dohovorili, je nám rybám u prdele! - odvetí zajac.              ', 1296, 3.71, 56),
	(13363, 'Rozprávajú sa traja poľovníci o svojich psoch. Prvý hovorí:\r\n- Môj pes je veľmi šikovný. Ja len vystrelím na kačicu a on už presne vie, kde dopadne, uteká a donesie ju.\r\nDruhý poľovník vraví:\r\n- Môj je ešte šikovnejší. Ja ešte ani ani nevystrelím a on už vie, kde budem strieľať. Uteká tam a donesie kačicu.\r\nTretí poľovník sa len uškŕňa a nakoniec hovorí:\r\n- Čože, to je nič. Vidíte, ja so sebou ani nemám pušku. Chytím psa za chvost, roztočím ho, hodím. On chytí letiacu kačicu a prinesie mi ju.\r\nTí dvaja sa čudujú a chcú to vidieť. Tak tretí poľovník chytí psa, roztočí a hodí. Medzitým, na lúke sa pasie krava s teliatkom. Teľa vraví:\r\n- Aha mama, letí pes.\r\nKrava na to: - Hm, dobrá tráva.              ', 777, 3.9, 56),
	(13364, 'Ide blcha so slonom po moste. Zrazu blcha povie: "Ale dupoceme, čo?"', 69, 3.52, 56),
	(13365, 'Leží zajac v tráve a fajčí.Ide okolo krava:\r\n-Taký malý a už fajčí?\r\n-A čo? Taká veľká a ešte nenosí podprsenku!', 128, 3.61, 56),
	(13366, 'V jeden pekný deň si sedí veverička no konári stromu. A chystá sa k obedu, má tri oriešky. Otvorí prvý oriešok a vypadnú z neho poľovnícke šaty, tak ho zahodí a otvorí druhý oriešok a z neho vypadnú plesové šaty, veverička z hnevom otvorí tretí oriešok a z neho vypadnú svadobné šaty, veverička sa nahnevá a povie. "Do kelu, kvôli tej hlúpej rozprávke sa asi dnes nenajem!!!"', 409, 2.58, 56),
	(13367, 'Čo spraví žirafa keď jej napľuješ do tváre?\r\n- Odkopne ti rebrík ', 73, 3.9, 56),
	(13368, 'Prečo sa rozplakalo malé prasiatko?\r\n- Lebo zistilo, že jeho mama ja sviňa.\r\n', 81, 3.6, 56),
	(13369, 'Do chovproduktu vrazí rozčúlený chlap s ľadovým medveďom na reťazi a reve:\r\n-"Kde je ten zasran, čo mi pred rokom predával bieleho škrečka?!"', 153, 3.72, 56),
	(13370, 'Vieš čo spraví žirafa keď jej napľuješ do ksichtu?\r\nOdkopne ti rebrík', 77, 3.39, 56),
	(13371, 'Zvieratká v lese sa rozhodli, že si dajú postaviť sídlisko. Tak pošlú najsilnejšieho medveďa do mesta, nech to na úradoch vybaví. Prejde mesiac, dva... Medveď sa vráti, ale bez úspechu, nevybavil nič. A tak pošlú líšku. Prejde pár mesiacov, líška sa vráti a nevybavila tiež nič. A tak sa rozhodne somár, že to vybaví on. A zvieratká na to: "Medveď silný a nevybavil, líška prefíkaná a nevybavila. A ako to hlúpy somár vybaví?" Prejdú dva dni a vráti sa somár aj s robotníkmi a sídlisko sa začína stavať. Zvieratká sa čudujú, ako je to možné a somár im hovorí: "Prídem do mesta na jeden úrad a tam kolega, prídem na druhý úrad - kolega... "', 697, 3.92, 56),
	(13372, 'Zhovárali sa dve blchy. Okolo išiel pes a tu jedna chytro povie: čau, už mi ide autobus', 91, 3.28, 56),
	(13373, 'Aký je rozdiel medzi vranou???\r\n-Žiadny...', 44, 2.82, 56),
	(13374, 'Sedí zajac na brehu rieky, fajčí trávu a strašne sa rehoce. Z rieky\r\nsa vynorí žaba a pýta sa zajaca, prečo sa tak smeje. Zajac jej\r\nhovorí:\r\n"Poď sem, žaba, potiahni si, preplávaj na druhú stranu rieky, tam\r\nvyfúkni a uvidíš, ako ti bude."\r\nŽaba si potiahne, prepláva na druhú stranu rieky, vynorí sa,\r\nvyfúkne, ľahne na breh a strašne sa začne smiať. Zrazu sa z rieky\r\nvynorí hroch a pýta sa žaby, prečo sa tak rehoce. Žaba mu povie,\r\nnech prepláva na druhú stranu, že tam jej zajac, ten mu niečo dá a\r\nuvidí, ako mu bude.\r\nHroch teda prepláva rieku, vynorí sa pri zajacovi\r\na v tom zajac vyplašene skríkne:\r\n"Žaba, ty hlupa, veď vyfúkni!!!"\r\n', 689, 3.92, 56),
	(13375, 'Príde kačka do baru a pýta sa: Máte chleba???? Príde na druhý deň a znova sa pýta: Máte chleba? Nie a ak ešte raz prídeš pribijem ti zobák k pultu. Na druhý deň príde znova a pýta sa: Máš klince?? Nie! Tak teda MÁŠ CHLEBA????\r\n ', 249, 3.67, 56),
	(13376, 'Malá korytnačka vylezie na strom a keď je hore, skočí dole. Parkrát to zopakuje. Na vetve nad ňou sa bavia dvaja vtáci: "Miláčik, nemali by sme jej už konečne povedať, že je adoptovaná?"', 201, 3.67, 56),
	(13377, 'Koná sa karneval... lienka je pozvaná, ale nevie za čo sa oblečie. Nakoniec si dá do úst tvaroch a ide na karneval. Keď tam dôjde zajac sa jej pýta. Za čo si lienka? A lienka si stlačí líca a povie...za vyrážku.', 226, 3.09, 56),
	(13378, 'Bola raz jedna kura super, pecka, bomba, hurá a mala tri kurčatá všetko samé dievčatá. No vajec mala päť a kurčatá sú len tri... Vrátime sa trochu späť, Tomáš vám to vysvetlí.G azda sviniar, surovec  išiel ráno na stanicu, napadla mu taká vec a z dvoch spravil praženicu. :D', 297, 2.33, 56),
	(13379, 'Príde líška k domčeku, v ktorom bývajú kozliatka, zaklope a hovorí:\r\n-Ťuky, ťuky, ťuk! Kozliatka otvorte, to som ja vaša mamička!\r\n-Naša mamička má slabší hlások!-nedajú sa oklamať kozliatka\r\nA tak líška ide ku kováčovi a na počkanie si nechá upíliť z hlasiviek a znovu si to namieri k domčeku:\r\n-Ťuky,ťuky,ťuk! Kozliatka otvorte to som ja vaša mamička...!\r\nKozliatka nakuknú dierou pod chatrčou a veselo hovoria:\r\n-Ty nie si naša mamička, naša mamička má biele nohy!\r\nA tak múdra,ale hladná líška podstúpi bolestivú depiláciu dolných končatín a opäť sa vyberie k domčeku:\r\n-ˇ5uky, ťuky, ťuk! Kozliatka otvorte to som ja vaša mamička...!\r\nKozliatka nakuknú popod chatrč, pohľad na líščie vydepilované nohy nevydržia a začnú sa rehotať ako uderené. Napokon zakričia:\r\n-Vieš čo? Kašli na to! Naša mama má kľúče....!\r\n ', 896, 4.02, 56),
	(13380, ',,Halló! Polícia pomóóóc, do izby mi vbehla mačka!!!"\r\n,,Zbláznili ste sa?! Kto volá?"\r\n,,Papagáj Fredi."\r\n', 116, 3, 56),
	(13381, 'Idú tri korytnačky po púšti, sú strašidelne smädné, idú rok, dva. Po 5 rokoch vidia v diaľke pohár. Prídu celé natešené k poháru, tešia sa, že sa napijú, ale pohár je prázdny. Nechajú pohár tak, a vydajú sa na ďalšiu púť za vodou.Po ďalších 5 rokoch prídu do oázy, chcú sa napiť, ale nemajú pohárik. Premýšľajú, čo s tým urobia, až jednu z nich napadne.\r\n"Jedna z nás sa vráti po pohárik."\r\nVyberú jednu z nich, a korytnačka vraví:\r\n"Dobre, ja pojdem, ale vy mi musíte sľúbiť, že sa nenapijete, kým budem preč."\r\nKorytnačky súhlasili a dohodli sa, že počkajú.Čakajú 5 rokov a hovoria si:\r\n"No, už by mohla byť pri pohári a pomaly by mohla ísť späť."\r\nPo ďalších 5 rokoch si hovoria:\r\n"No, už by tu mohla byť, ale počkáme ešte chvíľku."\r\nPočkajú teda ešte dva roky, ale potom je už ten smäd taký neznesiteľný, že si hovoria:\r\n"Napime sa, veď ona to aj tak nezistí, a ak sa nenapijeme, zahynieme, ako možno zahynula aj naša kamarátka."\r\nPrídu k pramienku, chcú sa napiť, keď sa z krovia ozve hlas tretej korytnačky:\r\n"Vááážené! Pokiaľ si nebudeme dôverovať, ja po ten pohárik nepôjdem." \r\n', 1197, 3.98, 56),
	(13382, 'Orol sa pol dňa spúšťa z vysokého brala strmhlav dole a len tesne nad zemou roztiahne krídla a zasa to zdvihne. Vidí ho vrabec, tak sa ho pýta:\r\n- Orol, čo to robíš?\r\n- Hm, mám na háku...\r\nTak si vrabec pomyslí "cool zábava":\r\n- Tak môžem ísť s tebou?\r\n- Ok.\r\nTak tam strmhlav padajú dole z vysokého brala a zbadá ich medveď. Keď sú opäť hore na brale, pýta sa ich:\r\n- Hej chlapi, čo to robíte?\r\n- Mame na háku...\r\nTak si aj medveď pomyslí "cool zábava":\r\n- Môžem sa k vám pridať?\r\n- Jasnééé...\r\nTak padajú všetci traja strmhlav z brala a keď sú tak 20m nad zemou, tak sa vrabec pozrie na medveďa a hovorí:\r\n- Hej medveď, však ty nemáš krídla!?\r\n- Nemám...\r\n- Nóóó tak ty máš ináč na háku...', 752, 3.75, 56),
	(13383, 'Kúpu sa dve brontosaurice a na brehu vidia kamarátku. Hovoria jej:\r\n"Poď sa s nami okúpať, voda je skvelá."\r\n"Keď ja nemôžem, vieš, mám svoje dni."\r\n"Čože??? Ty nepoužívaš ovce?"', 194, 3.76, 56),
	(13384, 'Príde sova k sove a vraví sova sove hu hu hu, čo ma strašíš', 65, 2.74, 56),
	(13385, 'Hrajú medveď, líška, divá sviňa karty. Zrazu medveď vraví: "NECHCEM BYŤ SVIŇA, ALE KTO BUDE OJEBAVAŤ DOSTANE PO TEJ RYŠAVEJ PAPULI...', 145, 3.9, 56),
	(13386, 'Pýta sa červík svojej mami:"Mami kde je ocino?"Šiel na ryby.', 64, 3.33, 56),
	(13387, 'Stretne slon nahého chlapa, pokrúti hlavou a pomyslí si:\r\n- No,to som zvedavý, ako sa s tým nažerieš!', 108, 3.83, 56),
	(13388, 'Kráľ džungle dá zvolať všetky zvieratká z lesa a vraví: Drahý bratia a sestry po dlhom čase sme zasa všetci spolu a ja som sa rozhodol že pôjdeme spoločne na výlet. A malá žaba opakuje po kráľovi rozhodol som sa, že pôjdeme všetci na výlet. Kráľ na ňu zazrie, ale nič nepovie. Odkašle si a vraví ďalej. Zajtra sa stretneme pod skalou pri jazere ráno o 7 00. A žaba zas ráno sa stretneme pod skalou pri jazere o  7 00. Kráľ už to ďalej neznesie a zvolá a to hnusne ukecané z veľkou hubou nikam nepôjde!!! A žaba na to chudák krokodíl a ten sa tak tešil.', 597, 3.65, 56),
	(13389, 'Sedia dve veveričky na strome a jedna druhej hovori:,,Zhodím Ťa!!" a zhodila ju.', 83, 3.69, 56),
	(13390, 'Aké to je, keď sa prasa miluje s kozou?\r\nKoza kričí: néé - néé\r\nA prasa: ale no - krof - krof', 101, 2.9, 56),
	(13391, 'Ide slimák po vode a utopí sa.', 32, 3, 56),
	(13392, '-Môj pes klame: hovorí susedka susedke.\r\n-Ale neverím: hovorí druhá.\r\n-Tak sa ho opýtajte, ako robí mačka.', 114, 3.32, 56),
	(13393, 'Stretne sa kliešť so psom.\r\npes´:" Ako sa máš kliešť?"\r\nkliešť na to: " Ale je to na prd už ma dnes dvakrát vytočili."', 130, 3.71, 56),
	(13394, 'Príde kačka do baru a pýta sa barmana:\r\n- Máš chleba?\r\n- Nemám\r\n- Máš chleba???\r\n- Som ti povedal že nemám!!\r\n- Máš chleba??\r\n- Počuj, ak sa ma ešte raz opýtaš či mám chleba, tak ti priklincujem zobák k pultu!!!\r\nKačka na to: - Máš klince??\r\n- Nie... \r\n- MÁŠ CHLEBA??????', 295, 4.04, 56),
	(13395, 'Ako kvaká žaba v Blave?Jakože úplne kvak, ne?', 49, 3.21, 56),
	(13396, 'Ide sa mravec a slon hrať na skrývačku. Slon ráta a mravec sa ukrýva. Slon ráta 1,2,3... Slon hľadá 1 deň druhý, 1 týždeň, 1 mesiac,1 rok, 2 rok, 3 rok a  hovorí: Do riti do riti do riti. Mravec vylezie zo slonovej riti a pýta sa: Ako si to vedel?', 262, 3.38, 56),
	(13397, 'Mladá žena kupuje papagája:\r\n"Tak čo, hlupáčik strapatý, vieš rozprávať?"\r\n"Samozrejme, že viem. A čo ty, fiflena vymaľovaná, lietať vieš?"', 155, 3.37, 56),
	(13398, 'Pes mal gumenú labku a toľko sa škrabal, až sa vygumoval.   ', 64, 3.03, 56),
	(13399, 'Sedí ľadový medveď so svojím synčekom na ľadovej kryhe a synček sa pýta:\r\nSynček: "Otecko, som ja ľadový medveď???"\r\nStarý maco: "Pravdaže si, synček..."\r\nSynček: "Otecko, som ja ľadový medveď???"\r\nStarý maco: "Pravdaže si, synček..."\r\nSynček: "Otecko, som ja ľadový medveď???"\r\nStarý maco: "Pravdaže si, synček..."\r\n"A prečo sa stále pýtaš???"\r\nSynček: "No, lebo mi je zima do riti!!!"', 421, 3.72, 56),
	(13400, 'Sedí chlapček na lavičke, pozerá na oblohu, vidí tam svätojánsku mušku a povie mame: "Aha mami, elektrická blcha." ', 124, 3.12, 56),
	(13401, 'Ide zajac po lese cely krvavý a líška sa ho pýta: \r\n"Zajko, čo sa ti stalo?" \r\n"Slonica ma použila ako vložku, ale ja jej to vrátim."\r\nA na druhý deň vidí vranu celú krvavú a pýta sa jej: \r\n"Vrana, čo sa ti stalo?"\r\n"Ááále, toho debila, ktorý povedal, že vložky s krídelkami sú lepšie, zabijem."', 319, 3.55, 56),
	(13402, 'Príde zlodej do bytu a papagáj mu vraví:\r\n"Feri ťa vidí, Feri ťa vidí." Zlodej zakryje klietku s papagájom a pokračuje vo vykrádaní bytu. Po chvíli sa papagáj opäť ozve: "Feri, nie je papagáj, Feri je pitbull..."', 228, 4.1, 56),
	(13403, 'Viete prečo kohút kikiríka so zavretými očami?\r\nAby sliepky videli, že to vie naspamäť!', 95, 3.8, 56),
	(13404, 'Išla húsenica po lese, zakopla o strom a utopila sa...', 56, 3.75, 56),
	(13405, 'Čo robí panda, keď horí les??? Horí tiež.', 47, 3.39, 56),
	(13406, 'Ide ježko po ceste a zabudne dýchať!', 39, 2.97, 56),
	(13407, 'Hulič trávy chytí zlatú rybku. Rybka: "Pusť ma a ja ti splním tri želania."\r\nHulič: "Dobre, ubal mi jointa!"\r\nRybka ubalí, hulič vyhulí.\r\nRybka: "Druhé želania?"\r\nHulič: "Ubal mi ešte jedného!"\r\nRybka ubalí, hulič vyhulí.\r\nRybka: "A posledné želanie?"\r\nHulič: "Ubal mne aj sebe!"\r\nRybka ubalí a zahulia si spolu.\r\nDruhý deň príde hulič zase chytať ryby a z vody na neho volá zlatá\r\nrybka:\r\n"Ani nerozbaľuj prúty, už som nám ubalila!"', 467, 4.03, 56),
	(13408, '-Viete prečo čierne ovce žerú menej ako biele?\r\n-Lebo bielych je viac...!!', 78, 3.37, 56),
	(13409, 'Prečo nemôže slimák utekať?\r\nLebo by mu viali oči.', 56, 2.87, 56),
	(13410, '- Prečo má ďateľ zobák? \r\n- Aby si nerozbil hlavu.', 55, 3.36, 56),
	(13411, 'Príde zajac za medveďom a vraví mu: "Medveď, prevedieš ma cez hranice?" Medveď mu odpovie: "Dobre, strčím si ťa do vrecka." Na hranici ich zastaví policajt a ten sa pýta medveďa: "Medveď, čo to máš vo vrecku?" Medveď sa ťľapne po vrecku a vraví: "Ááále nič, to je en fotka zajaca.."', 306, 2.95, 56),
	(13412, 'Príde domov zajac a žena mu hovorí: "Fuj!!! Prečo si špinavý, a tak smrdíš?" "Áále, kdesi som v hore spadol a zapáchalo to tam, tak som napáchol."\r\nPríde domov malý zajko a mama mu hovorí: \r\n"Fuj, prečo si špinavý, a tak smrdíš?" "Áále, videl som ako si medveď utiera zadok s otcom, tak som sa od smiechu posral!" ', 337, 4.16, 56),
	(13413, 'Pláva si v mori veľrybí samec vedľa svojej veľrybej družky a mrmle:\r\n"Celý svet sa snaží zachrániť náš druh, vedci zasadajú, ekológovia sa búria, Greenpeace sa z toho môže posrať, ale teba bolí hlava...."', 224, 3.8, 56),
	(13414, 'Príde dievčina do nóbl reštaurácie a objedná si slimákov. Prvýkrát cucne a nič. Skúsi druhý, tretíkrát ale stále nič. Pozrie teda do ulity a odtiaľ jej slimák hovorí: "Nečum a fajči." ', 205, 3.71, 56),
	(13415, 'Prechádzajú sa dva polárne medvede po púšti a jeden hovorí druhému: "Tu muselo, ale dobre snežiť, keď to tu tak posypali.."', 133, 3.22, 56),
	(13416, 'Čo si myslí kohút a sliepka, keď sa chce kohút milovať?\r\nSliepka: "Ešte kúsok pobehnem, aby si nemyslel že som ľahká."\r\nKohút: "Keď ju dobehnem, tak ju pomilujem, keď nie, tak sa aspoň prebehnem."', 211, 3.53, 56),
	(13417, 'Zajko a medveď chytia zlatú rybku a každý si môže želať tri priania. Prvé - medveď: "Chcem, aby všetky medvede na celom svete boli medvedice." Zajko: "Chcem motorku."\r\nDruhé - medveď: "Chcem, aby všetky ženy na planéte boli medvedice." Zajko: "Chcem prilbu a kľúčiky."\r\nTretie - medveď: "Chcem, aby aj všetci muži na svete boli medvedice." Zajkovi to nedá a tak si želá: "Chcem, aby bol medveď gay!"', 425, 4.1, 56),
	(13418, 'Plazia sa dva hady po púšti a jeden sa pýta druhého: "Sme jedovatí?""Prečo?""Lebo som si práve zahryzol do jazyka."', 122, 3.66, 56),
	(13419, 'V lese otvoria nový obchod. Všetci chcú nakupovať, tlačia sa dopredu k dverám. Malý zajačik sa silno tlačí dopredu.\r\nVlk ho odkopne až na samý koniec. Nazlostený zajačik sa vráti domov a príde na druhý deň. Stane sa to isté. Potom príde na tretí deň, a keď ho vlk odkopne,začne vrieskať:\r\n" No keď chcete, ja môžem otvoriť až o týždeň!!!"', 371, 4.07, 56),
	(13420, 'Slon stúpi na žabu, tá vypúli oči, slon sa nad ňu nahne a hovorí: "To ale čumíš na moje nové adidasi, čo?"', 118, 3.81, 56),
	(13421, 'Je to modré a lieta to? Čo je to?\r\nVrabec s kŕčovými žilami.', 66, 3.29, 56),
	(13422, 'Idú si tak tri korytnačky po púšti a strašne vysmädnú. Idú deň - vodu nenašli. Idú dva dni - vodu nenašli. Takto sa to opakovalo už niekoľko dní, až nakoniec našli malé jazierko. Dohodnú sa, že jedna z nich sa vráti pre pohár. Čakajú rok a korytnačka, ktorú pre pohár poslali sa nevrátila. Čakajú dva roky a korytnačka sa ešte stále nevrátila. Po troch rokoch si korytnačky povedia, že aj keď sa napijú, korytnačka to nezistí, lebo aj tak to vidieť nebude. Pristúpili teda k jazierku, už už sa chceli napiť, keď zrazu z neďalekých kríkov vyšla korytnačka a povedala: "Tak to teda nie dámy, ak si nebudeme dôverovať, ja nikam nejdem."', 687, 3.7, 56),
	(13423, 'Žaba vidí letieť bociana a kričí naňho.\r\n"Hej bocian, kde ideš?"\r\nBocian hovorí: "Na žaby s veľkými hubami."\r\nŽaba si povzdychne a vraví: "Hmm chudák krokodíl.".', 176, 3.79, 56),
	(13424, 'Ide žaba po lese a stretne ježka a pýta sa: "Ježko nemáš trávu?""Nie, nemám."Tak ide žaba ďalej, stretne líšku a pýta sa: "Líška nemáš trávu?""Nie, ja nemám, ale orol sedí hore na skalách a on má."Tak sa žaba vyštverá hore na skaly, dá si spolu s orlom pár šlukov a vysmiata žaba ide preč. Stretne krokodíla. A on na ňu: "Žaba, ty mrcha, ty si hulila, odkiaľ máš?" Tak mu žaba povedala, krokodíl sa vyštverá hore na skalu, a keď ho orol uvidí povie: "Žaba, do riti, to ako vyzeráš?"', 527, 3.69, 56),
	(13425, 'Kráčajú blcha a slon po ceste až prídu k mostu, kde je napísané: "Slonom vstup zakázaný."Blcha sa pozrie na slona a vraví mu: "Schovaj sa za mňa kamarát, ja som nenápadná."', 186, 3.58, 56),
	(13426, 'Príde zlodej do domu a niekto na neho kričí: "Ceri ťa vidí? Ceri ťa vidí!"Zlodej zbadá klietku a v nej papagája. Zasmeje sa a klietku zakryje. O chvíľu sa z klietky ozve: "Ceri nie je papagáj, Ceri je pitbull!" ', 223, 3.65, 56),
	(13427, 'Pani učiteľka je s deťmi v saune, a Móricko sa jej pýta: "Pani učiteľka, čo to máte medzi nohami ?""Mačičku, Móricko, mačičku.""A prečo sa nehýbe?"."Ona spí." "Spí? Mŕtva je, preto tak smrdí!"', 212, 3.7, 56),
	(13428, 'Dve žaby sa opaľujú a začne pršať Jedna hovorí tej druhej: "Skočme do vody, aby sme nezmokli." ', 103, 3.29, 56),
	(13429, 'Stretnú sa tri sovy a prvá hovorí: "Našla som hodinky."Druhá hovorí: "Našla som kravu."A tretia hovorí: "Ja som nenašla nič."Na druhý deň sa stretnú opäť tie isté sovy a prvá hovorí: "Stratila som hodinky.""Druhá hovorí: "Stratila som kravu."A tretia skríkne: "Doparoma, už je po šiestej, musím ísť nadojiť kravu."\r\n', 343, 3.9, 56),
	(13430, 'Viete, aké je posledné slovo ryby pred smrťou?\r\n-Nijaké, ryba je predsa nemá!', 82, 3.23, 56),
	(13431, 'Ide zajko po lese a nájde pušku. Príde za medveďom a vyhráža sa mu, že ak nezje hovno čo leží na zemi, tak ho zastrelí.\r\nMedveď: Nezjem ho.\r\nZajac: Medveď, ty zješ to hovno!!\r\nZajac stlačí spúšť a nič, znova skúsi vystreliť a nič. \r\nZajac: Tak keď nechceš, ja si dám...', 295, 3.51, 56),
	(13432, 'Ide krava do kina a sadne si za koňa. Kôň sa otočí a vraví: Mne sa sníva, krava v kine.', 94, 3.56, 56),
	(13433, 'Kocúr beží ozlomkrky za mačkou.\r\nTá na neho volá: "Ja nie som myš."\r\nA kocúr na to: "A kto povedal, že som hladný?"', 125, 3.49, 56),
	(13434, 'Jedného dňa si zajačik veselo pobehuje po lese, keď pri jednom strome uvidí jeleňa ako fajčí.\r\n- Čo robíš? Zbláznil si sa? V takýto pekný deň si na dobrom vzduchu otráviš pľúca? Poď radšej so mnou behať, aby sa ti pľúca naplnili kyslíkom!\r\n- Máš pravdu! - hovorí jeleň a začne behať so zajačikom. Ako bežia, uvidia líšku, ako šňupe.\r\n- Hej, ty! - hovorí jeleň - tu v lone prírody šňupeš? Poď radšej s nami behať, aby sa ti pľúca naplnili kyslíkom!\r\n- Máš pravdu! - povie líška a začne behať s ostatnými. Trochu ďalej stretnú vlka, ako práve drží injekčnú striekačku.\r\n- Hej, tu v lone prírody sa chceš nadrogovať? Poď radšej a bež s nami! - hovorí líška.\r\n- Choďte dopekla! Vždy, keď sa zajačik našľahá extázou, musíme behať po lese....?', 820, 4.23, 56),
	(13435, 'Ide ježko po ceste a zabudne dýchať.', 39, 2.93, 56),
	(13436, 'Pri okienku v banke sedí vrana s visiacou kvapkou na zobáku a hovorí pokladničke: "Navaľ prachy, lebo kýchnem."', 117, 3.07, 56),
	(13437, '- Prečo má ďateľ zobák?\r\n- Aby si nerozbil hlavu.', 54, 3.4, 56),
	(13438, 'Jožko sa pýta Maťka: - Keby si bol na strome a pod tebou by boli dve pumy, jaguár, medveď a lev a ty by si mal pušku iba s jedným nábojom, čo by si robil?\r\n- ???\r\n- Predsa zastrelíš leva, obuješ si pumy, nasadneš na jaguár a zrazíš medveďa.', 257, 3.69, 56),
	(13439, 'Rodina si ide kúpiť papagája, predavač im jedného ponúkne a upozorní ich, že ten papagáj je z bordelu. Matka rodiny mu odpovie, že to nevadí, že oni ako náboženská rodina, ho prevychovajú. Na druhý deň príde domov dcéra a papagáj hovorí: "Áááá, nová pracovníčka." Matka mu odpovie: "Keď príde môj manžel domov, vytrhá ti perie." Príde druhá dcéra a papagáj hovorí: "Áááááá nová pracovníčka." Matka mu odpovie: "Keď príde môj manžel, zabije ťa." Manžel príde večer domov a papagáj hovorí: "Áááááá Milan, náš stály zákazník!!"', 593, 3.94, 56),
	(13440, 'Viete čo je maximálna opatrnosť?\r\n???\r\nKeď slimák brzdí v zákrute.', 73, 3.6, 56),
	(13441, '"Pane, koľko stojí ten kôň?""Stotisíc.""A čo by ste povedali na polovicu?""Je mi ľúto, ale polovičku koňa vám nepredám."', 132, 3.19, 56),
	(13442, 'Je to čierno-biele a leží to v jame. Čo je to?\r\n-Koza oblepená izolačkou.', 79, 3.76, 56),
	(13443, 'Mladá moľa vyletela prvýkrát zo skrine von.\r\nDlho sa nevracala späť. A keď sa konečne vrátila domov, rodičia aj ostatní dospelí sa jej pýtajú:\r\n"No, povedz ako bolo vonku, že si sa tak dlho nevracala?"\r\n"Á, dobre bolo, veľmi dobre. Všetkým ľuďom som sa veľmi páčil..."\r\n"Ako to vieš?"\r\n"Lebo len som vyletel, všetci mi tlieskali..."', 358, 3.83, 56),
	(13444, 'Zajac behá po lúke a strašne sa rehoce. Mustang sa ho pýta, prečo sa tak smeje.\r\n"Prebehni sa aj ty a uvidíš."\r\nKôň behá celú hodinu a nič. Zajac sa čuduje:\r\n"A teba tá tráva nešteklí na vajciach?"', 214, 4.05, 56),
	(13445, 'Rozprávajú sa dva hady. Prvý: "Sme jedovatý?"\r\nDruhý: "Prečo?"\r\n"Lebo som si práve zahryzol do jazyka."  ', 112, 3.93, 56),
	(13446, 'Lieta orol nad lesom a zrazu zbadá, že na pníku niečo sedí a on nevie čo to je. Letí nižšie a stále nevie čo to na pníku sedí. Zletí celkom dolu a vraví:\r\n- "Ahoj, sova...!?"\r\n- "Ja nie som sova..."\r\n- "A kto že si?"\r\n- "Ja som myška."\r\n- "Myšky nemajú také veľké oči..." - nedôverčivo odpovedá orol.\r\n- "Práve seriem..." - vysvetlí mu myška.\r\n', 373, 4, 56),
	(13447, 'Ide zajac okolo medveďa a hovorí mu:\r\n- Hej medveď, pozdravuje ťa Hutil.\r\nMedveď: - Aký Hutil??\r\nZajac:- Ten čo ti kok.tom krútil.\r\nIde zaja na druhý deň a hovorí medveďovi"\r\n- Hej medveď, pozdravuje ťa Hutil.\r\nMedveď: - Aký Hutil??\r\nZajac: - Ten čo ti kok.tom krútil.\r\nTakto sa to opakuje týždeň... Medveď ide za líškou a hovorí jej ako si zajac robí z neho srandu. Líška mu poradí, aby povedal zajacovi, že ho pozdravuje Rehál, to je ten čo ťa do riti je.al...A tak ide medveď natešený za zajacom a hovorí mu:\r\n- Hej zajac, pozdravuje ťa Rehál.\r\nZajac:- Ja viem, hovoril mi Hutil.\r\nMedveď: - Aký Hutil??\r\nZajac: - Ten čo ti kok.tom krútil.\r\n', 686, 4.15, 56),
	(13448, 'Pozval medveď všetky zvieratká z lesa na párty a povedal im, že každé z nich mu musí priniesť pekný a hodnotný darček, ináč ho svojim veľkým vtákom "vymastí" po chrbte. Prišiel vlk a daroval mu hi-fi súpravu. Medveď sa potešil a nazval ho kamarátom. Líška mu priniesla farebný televízor, veľká kamarátka a podobne aj ostatné zvieratká, keď tu zrazu dôjde na rad zajac a daruje mu obyčajnú malinu. Maco sa naserie,vytiahne svojho veľkého vtáka a trestá ním zajačika po chrbte jedna radosť. Ten sa však začne strašne rehotať.\r\n- Čo je zajko, teba bitka nebolí? - pýta sa medveď\r\n- Ej bolí ma to, bolí, ale nemôžem sa nesmiať keď vidím, že ježko ti nesie obyčajnú slivku...', 732, 4.04, 56),
	(13449, '- Viete prečo má bocian také dlhé nohy?\r\n - Aby ho žaby nekopali do zadku!!!', 81, 3.37, 56),
	(13450, 'Medveď zvolá všetky zvieratká na lúku, aby predniesol správu o činnosti:\r\n- Za minulý mesiac bolo zabitých autami 156 žiab, 78 mačiek.... Poprosím myši vzadu, aby prestali robiť mexické vlny!', 206, 4.17, 56),
	(13451, 'Stádo jeleňov išlo k napájadlu a zastaví ich ježko rezkým hlasom:\r\n"Stojte! Je tu medzi vami nejaký tvrďas?"\r\n"Nie."\r\n"Tak mi každý dá korunu!"\r\nNa druhý deň zase išli piť a zase ich haltuje ježko:\r\n"Stojte! Je tu medzi vami nejaký tvrďas?"\r\n"Nie."\r\n"Tak každý po korune a môžete ísť."\r\nNa tretí deň už sa jeleňom nechcelo platiť, tak požiadali vlka, či by im nešiel robiť tvrďasa. Na obvyklom mieste ich zastaví ježko:\r\n"Stojte! Je tu medzi vami nejaký tvrďas?"\r\nVystupil vlk:\r\n"Je. A čo má byť?"\r\nSpoza kríčka vyšiel medveď a hovorí:\r\n"Tvrďas stovku a ostatní po korune!"', 622, 3.64, 56),
	(13452, 'Nasraté prasiatko ide po lese a stretne líšku. Líška mu hovorí:\r\n- Ahoj prasiatko, ako sa máš?\r\nA nasraté prasiatko na to:\r\n- Čo sa do mňa staráš, ty stará vyplznutá ryšavá smradľavá chudera!\r\nLíška sa otočí a nasraté prasiatko ide ďalej. Zrazu stretne vlka a ten mu tiež hovorí:\r\n- Ahoj prasiatko, ako sa ti vodí? Už sme sa dlho nevideli.\r\nNasraté prasiatko:\r\n- Nestaraj sa do mňa ty sivý prašivý blcháč!\r\nNasraté prasiatko ide ďalej lesom a stretne vílu. Víla mu hovorí:\r\n- Vieš čo prasiatko? Dnes si bolo ozaj protivné. Nesplním ti tri želania ale iba dve. Hovor!\r\nPrasiatko:\r\n- Tak dobre. Chcem jamu 3 krát 3 krát 3 metre a plnú hovien.\r\n- Máš ju mať. A tvoje druhé želanie?\r\n- A teraz si to zožer ty krava priesvitná.', 778, 3.92, 56),
	(13453, 'Zídu sa všetky zvieratká z džungle a lev hovorí:\r\n- "Pôjdeme na výlet."\r\nA žaba to zopakuje: - "Pôjdeme na výlet."\r\n- "Zbaľte si veľa jedla a pitia."\r\nA žaba to zase zopakuje: - "Zbaľte si veľa jedla a pitia."\r\nLeva to naštve a povie: - "Okatá, zelená v zadu. Choď preč."\r\nA žaba na to: - "Ale veď krokodíl sa taaak tešil."', 347, 3.58, 56),
	(13454, 'Načo potrebuje ďateľ zobák?\r\nAby si nerozbil hlavu.', 55, 2.51, 56),
	(13455, 'Sedia zvieratká v lese a pošlú slimáka pre pivo. Čakajú hodinu, dve a po tretej hodine sa veverica ozve: "Keby som si šla pre to pivo sama, tak už ho mám 4 razy vypité."A spoza kríka sa ozve: "Prestaňte, lebo pre to pivo ani nepojdem...."', 250, 3.85, 56),
	(13456, '- Jožko, čo stojí ten pes?\r\nJožko: - Ja neviem, čo si nesadne.\r\n- Ale ja myslím, že koľko stojí?\r\nJožko: - No už hádam aj polhodinu.', 144, 3.72, 56),
	(13457, 'Ide pes po púšti a hovorí:                           \r\n-Ak nenájdem strom, tak sa asi poštím.', 99, 3.75, 56),
	(13458, 'Hrajú sa štyri sliepky s kohútom na schovávačku. Kohút počíta. Dve sliepky sa skryjú do kurníka a dve do šopy.Keď kohút dopočíta, potkne sa o kameň a zakričí: "Kurník šopa."', 193, 4, 56),
	(13459, 'Ide zajac po lese s medveďom. Medveďovi treba čúrať, tak ide k stromu a počíta: 1, 2, 3, 4, 5, 6, 7.\r\nZajac sa ho pýta: "Medveď, čo si to počítal?"\r\nMedveď mu na to: 1. je dole gate,\r\n2. je dole slipy,\r\n3. je dole predkožka,\r\n4. je vyčúrať sa,\r\n5. je hore predkožka,\r\n6. je hore slipy,\r\n7. je hore gate.\r\nPo chvíľke zajac oznámi medveďovi, že aj jemu treba na záchod. Tak idem k najbližšiemu stromu a počíta: 1, 2, 3-5, 3-5, 3-5, 3-5, 3-5,...', 470, 3.94, 56),
	(13460, '- Viete ako si dá slonica tampón?\r\n- Sadne si na ovečku.', 59, 4.04, 56),
	(13461, 'Stretne sa žaba so slonom a slon vraví žabe: \r\n- "Juj, teba by som nechcel za ženu, lebo si strašne škaredá."\r\n-"Ani ja teba slon, lebo si veľký a pindíka máš na nose."', 180, 3.46, 56),
	(13462, 'Ide mravec a slon po moste a mravec hovorí: "Ale dupeme, čo?"', 63, 3.52, 56),
	(13463, 'Príde kačka do baru a pýta sa barana\r\nMáš chleba??\r\nNie nemám...\r\nMáš chleba??\r\nNie nemám..\r\nMáš chleba??\r\nEšte raz sa ma spýtaš máš chleba tak ti ten zobák priklincujem k pultu.\r\nMáš chleba??', 211, 2.47, 56),
	(13464, 'Medveď zakázal zvieratkám v lese kakať. Zajacovi už strašne trebalo, a tak zašiel za strom a vykadil sa. O chvíľu ide okolo medveď, a tak zajac hovno rýchlo zakryje labkami. Medveď zastane pri zajacovi a pýta sa ho: "Zajac, čo to máš v tých labkách?"Zajac mu odpovie: "Motýľa."Medveď? "Hej? Tak ukáž!"Zajac odkryje ruky a zvolá: "Ejha, ten tu ale nakadil."', 380, 4, 56),
	(13465, 'Zajačik uteká po lese a vykrikuje: "Znásilnil som levicu, znásilnil som levicu!" Ostatné zvieratá ho upozorňujú: "Zajačik, buď radšej ticho lebo náhodou ťa bude počuť lev a bude zle."Zajačik nato kašle a ďalej vykrikuje: "Znásilnil som levicu, znásilnil som levice!" Zrazu ho začuje lev a začne ho naháňať po celom lese. Zajačik sa skryje do kríkov, kde za ním skočí aj lev. Ten sa tam však zasekne a nemôže ďalej, v kríkoch mu zostane predná časť tela. Zajačik vyjde z kríkov, obíde ich, pozrie na zaseknutého leva a vraví si: "Tak toto mi fakt nikto neuveri."', 604, 4.04, 56),
	(13466, 'Na strome sedí sova. Vidí ju medveď a hovorí:\r\n- Koľko je hodín?\r\n- 2 vajci a deci vody, ale Žižkov aj tak vyhrá. ', 123, 3.28, 56),
	(13467, 'Ide dážďovka po ceste a stretne druhú, ktorá sa jej veľmi páči a tak hovorí: \r\n"Ty si taká pekná, že sa do teba asi zaľúbim."\r\nOna na to: "Neblázni, veď ja som tvoj druhý koniec."', 196, 4, 56),
	(13468, 'Idú dva slony po púšti. Jeden je zelený a druhý je tiež ježko...', 71, 2.93, 56),
	(13469, 'Viete ako robí sliepka??\r\n- Póók pok pok.\r\nA medveď??\r\n- Brum brum. \r\nA ako robí líška?\r\n- Na týchto základoch môžete stavať.', 137, 2.39, 56),
	(13470, 'Ide mladík okolo jazera a zrazu na neho začne kričať žaba, že mu splní jedno želanie. Mladík k nej príde bližšie, pozrie sa na ňu a povie: "Len aby by si sa neposrala!" .. A o tri dni žabu roztrhlo.', 212, 4.1, 56),
	(13471, '- Čo sa stane ak skrížime bieleho žraloka a zlatú rybku?\r\n- Zviera, ktoré vám splní posledné želanie.', 111, 3.11, 56),
	(13472, 'Pýta sa slon ťavy:\r\n"Prečo máš prsia na chrbte"?\r\nA ťava povie:"Ty sa radšej ani neozývaj, ty máš mužský úd na ksichte."', 133, 3.94, 56),
	(13473, 'Zajac nájde na zemi 1 cent a ostatní mu hovoria, že je teraz milionár. Zajac sa teda vyberie do obchodu s elektro spotrebičmi. Nakúpi si CD-prehrávače, DVD-prehrávače,.... Príde k pokladni a predavačka mu povie sumu, ktorú má za nákup zaplatiť. Zajac vyloží na pult 1 cent a predavačka sa nechápavo pozerá. A zajac jej na to: "No čo čumíš, vydávaj."', 375, 2.7, 56),
	(13474, 'Ide macko Pú cez les s prasiatkom a prasiatko sa ho pýta: \r\n- Macko Pú, kam ideme?\r\n- Zabiť sviňu.\r\n- A neutečie nám?\r\n- A kamže by si utekalo?', 151, 2.87, 56),
	(13475, 'Ide čierny mamut pralesom a odrazu ho napadne skupinka mladých bielych slonov. Dokopú ho, dobijú a odídu. Mamut sa zdvihne, otrasie sa a hovorí "Blbí skinheadi."', 168, 3.84, 56),
	(13476, 'Na lúke sa pasú dve kravy. Jedna sa pýta druhej: "Prečo trasieš vemenom?""Zajtra mám narodeniny, tak robím šľahačku!"', 127, 3.87, 56),
	(13477, 'Stretnú sa dve korytnačky a jedna z nich nemá pancier. Tá druhá sa jej pýta:\r\n- A tebe sa čo stalo?\r\n- Ááále, ušla som z domu!\r\n ', 140, 3.6, 56),
	(13478, 'Veverička nájde tri oriešky. Otvorí prvý a nájde poľovnícku výstroj. Otvorí druhý a nájde strieborné šaty. Otvorí tretí a nájde svadobné šaty.\r\nVeverička hovorí: "Kvôli tej blbej popoluške sa už ani nenažeriem!"', 236, 4.17, 56),
	(13479, 'Viete prečo nemôže ísť mačka do vesmíru?\r\nLebo by vypila celú mliečnu dráhu...', 88, 2.86, 56),
	(13480, 'Ide macko Puff s prasiatkom. Prasiatko sa ho pýta: "Kam ideme Puff?"\r\nPuff: "Zmlátiť sviňu."\r\nPrasiatko: "A neutečie nám?"\r\nPuff: "A kam by si utekalo?"', 158, 3.4, 56),
	(13481, 'Na vyprahnutej púšti je veľká nuda. Leva napadla myšlienka, že zvieratká roztriedi na múdre a pekné.Na púšti sa víril prach, a keď usadol v strede ostala len žaba. Lev zreval: "Žaba hýb sa!"Žaba na to: "A čo sa mám roztrhnúť?!" ', 249, 3.1, 56),
	(13482, 'Pobehuje kohút nervózne v čakárni v pôrodnici\r\nOdrazu vyjde zo sály doktor a hovorí:\r\n"Je to vajce!"', 107, 3.54, 56),
	(13483, 'Prasiatko, prečo plačeš?Lebo moja mama je sviňa.', 52, 3.55, 56),
	(13484, 'Lovec zájde do lesa za poľovačkou diviny. Uvidí medveďa a strelí ho do pravého ramena. Medveď ide za ním a znásilní ho.Na druhý deň dôjde lovec zasa. Uvidí medveďa a strelí ho do ľavého ramena. Medveď ide za ním a znásilní ho.. Na tretí deň dôjde lovec zasa, ale s bazukou.. Uvidí medveďa a vystrelí ranu vedľa neho..Medveď ide za ním a hovorí mu: "Počúvaj lovec, že ty si sem nechodíš zastrielať?"', 437, 3.93, 56),
	(13485, 'Príde dievčatko do obchodu zo zvieratkami a vraví: "Chcela by som malé morčiatko, teta.""Aké? Biele, hnedé, sivé,...?""To je jedno, môjmu pytónovi na farbe nezáleží."', 179, 3.1, 56),
	(13486, '- Ktoré zviera je najväčší optimista?\r\n- ???\r\n- Klokan! Vyskakuje si aj s prázdnym vreckom!', 97, 3.59, 56),
	(13487, 'Príde černoch s veľkým farebným papagájom na pleci do baru a barman sa ho pýta:\r\n- Ten je ale krásne veľký a farebný, odkiaľ ho máte?\r\nA papagáj na to odvrkne:\r\n- Z Afriky, tam je ich plno.', 203, 3.78, 56),
	(13488, 'Príde kuriatko k lekárovi a lekár s ho pýta: "Kuriatko, čo sa ti stalo?" "Budď ticho, to je prepad."', 106, 3.15, 56),
	(13489, 'Domáce zvieratká súťažia kto naženie viac hrôzy. Prasiatko:"Ja sa vyváľam v bahne, začnem krochkať a všetok dobytok utečie.""To je nič," hovorí býk."Ja začnem fučať, vbehnem medzi  ľudí a všetci utečú."A kuriatko hovorí:"Ja si ľahnem na zem, robím sa, že som mŕtve a pol republiky sa zhrozí od strachu."', 333, 3.77, 56),
	(13490, 'Ide malé kuriatko, zrazu uvidí praženicu a pýta sa: Brácho, si to ty?', 74, 3.7, 56),
	(13491, 'Včera hlásili, že zo ZOO ušla nejaká príšera, nehľadajú náhodou teba?', 79, 3.54, 56),
	(13492, 'Tri sliepky sa hrajú no schovávačku. Jedna sa schová do kurína, druhá do šopy a tretia počíta: "1,2,3 ideeeem." Potkne sa o kamienok a hovorí "Kurník, šopa!" Sliepky vylezú zo svojich úkrytov a hovoria jej: "To nie je fér, ty si sa určite dívala!"', 264, 4.09, 56),
	(13493, '- Viete, čo vznikne zkrížením ježka a žirafy?\r\n- Dvojmetrová zubná kefka. ', 82, 3.76, 56),
	(13494, 'Slimák sa nesie na korytnačke a kričí: "Rýchlejšie, pridaj, vlečieš sa ako slimák!" \r\n\nOtec sa pýta učiteľky: "Prečo má môj syn zo zemepisu päťku?"\r\n"Pretože hľadal Plavecký Štvrtok v kalendári." \r\n\nChváli sa Janko Maťkovi: "My ideme na mesiac do Álp."\r\nPríde Maťko domov a pýta sa ocka: "Aj na Mesiaci sú Alpy?"\r\n\nJožko sa chváli: "- Ja som prečítal veľa kníh."\r\nA hneď dodáva: "Obidve sa mi páčili."\r\n\nVo vrtuľníku jeden z pasažierov ukáže nahor a pýta sa: "Ty, čo je to tam nad nami?"\r\n\n"Určite klimatizácia. Odkedy sa to netočí, náš pilot sa potí..."\r\n\n– Katka, čo si sa s kamarátkou pohádala? Váš dnešný telefonát trval len 30 minút!\r\n– To nebola kamarátka, to bol omyl!', 742, 4.03, 56),
	(13495, 'Poznáme viac druhov vtákov:\r\ndravé - orol\r\nsravé - holub', 60, 3.09, 56),
	(13496, 'Viete prečo nemôžete ísť do vesmíru s mačkou???\r\n????? \r\nLebo by vypila celú mliečnu dráhu.', 101, 3.2, 56),
	(13497, 'Sedí hroch v bahne, prdí do vody a počíta bublinky. Príde k nemu druhý hroch a vraví: "Poď so mnou zašlapovať žaby!""Si sa zbláznil, nie? To mám všetko nechať a ísť robiť kraviny?"', 198, 3.76, 56),
	(13498, 'Macko Pú príde do rezníctva a pýta sa: "Máte šunku?" Predavač odpovie: "Áno, máme." Pú vytiahne guľovnicu, zastrelí predavača a pre seba si zašepká: "To je za prasiatko!"', 185, 3.68, 56),
	(13499, 'Stretnú sa dve kočky. Jedna hovorí: "Ahoj!"A druhá na to: "Mééééé!""Čo blbneš, prosím ťa?!""No čo, učím sa cudzie jazyky."', 138, 3.41, 56),
	(13500, 'Žaba stretne hrocha v bahne a vraví mu: "Vylez von!!!"Hroch: "Prečo???"Žaba: "Vylez von!!!"Hroch: "No tak dobre, čo si chcela???"Žaba: "Nič, len či sme si nevymenili plavky."', 182, 3.85, 56),
	(13501, 'Zídu sa všetky zvieratká z džungle a lev hovorí: „Pôjdeme na výlet.“ „Pôjdeme na výlet“, zopakuje žaba.  „Zbaľte si veľa jedla a pitia.“ – hovorí lev. „Zbaľte si veľa jedla a pitia“, opakuje žaba. Lev sa už nahnevá a vraví: „To zelené zviera s veľkou papuľou nikam nepôjde!“ A žaba na to: „Chudák krokodíl, a ten sa taaak tešil!“', 382, 4.29, 56),
	(13502, 'Slon sa pýta ťavy:\r\n- Prečo máš prsia na chrbte?\r\n- Ťava na to:\r\n- Sa pýta ten čo má penis na tvári!', 110, 4.23, 56),
	(13503, 'Ve městečku mají obrovský problém s holuby, kálí na sochy, pro trus není kam stoupnout. Nic proti nim nepomáhá, až jednou přijde za starostou divnej fousatej týpek ve špinavém kabátě s tím, že je problému zbaví. Starosta se ptá, co by to tak stálo. Týpek praví:\r\n- Nic, ale pod jednou podmínkou. Nesmíte se vůbec na nic zeptat, ani jedinou otázku. Jinak to bude za milion.\r\nTak on je ještě ke všemu hloupej, myslí si starosta. To přece není problém se na nic nezeptat, tak to za pokus stojí.\r\nJdou spolu na náměstí. Týpek zaloví v kabátě, vytáhne z něj úplně žlutýho holuba a pustí ho do vzduchu. Žlutej holub odlétá pryč a všichni ostatní holubi ho následují, takže za minutku nezůstane v městečku ani jediný.\r\nStarosta na to zírá s otevřenou pusou a nevěří svým očím. Je vidět, jak uvnitř bojuje s obrovským dilematem. Nakonec promluví:\r\n- Pane, já se vás musím na něco zeptat. Já vím, bude to stát milion, ale za to mi to stojí. A žlutýho cikána byste neměl?', 1050, 3.79, 56),
	(13504, 'Rozprávajú sa dve muchy: Keby sme boli tri to by bola pekná štvorica.', 73, 3.26, 56),
	(13505, 'Letela kačka svetom, zasiahli ju guľometom. Letela kačka dole, na mínové pole. A tam celá od radosti, rozhadzuje svoje vnútornosti.', 138, 3.08, 56),
	(13506, 'Ide zajac po lese a spieva si: „Idem na medveďa... idem na medveďa...“ \r\nPo chvíli zajaca stretne líška a pýta sa ho: „Čo si to spievaš, zajac?“\r\nZajac na to: „Idem na medveďa... idem na  medveďa...“\r\nLíška, ako to počuje, sa rýchlo rozbehne za medveďom a vraví mu: „Medveď, medveď, zajac ide na teba... utekaj sa schovať.“\r\nMedveď sa pousmeje a s ľahkosťou vraví: „Ja sa ho nebojím.“\r\nPo chvíli medveď príde za zajacom a pýta sa ho: „Zajac, čo si to spievaš?:\r\n„Idem na maliny a trepem chujoviny!“\r\n', 556, 4.21, 56),
	(13507, 'Ide medveď s ježkom na motorke. Idú 60-tkou a medveď sa pýta ježka: Bojíš sa?“ A ježko hovorí: „Nie!“ Medveď dupne na plyn a idú 120-tkou. Medveď sa pýta ježka: „Ježko, bojíš sa?“ A ježko opäť hovorí: „Nie!“ Medveď sa naštve a idú 200. Medveď sa pýta: „Ježko, a teraz sa bojíš.“ A ježko odpovedá: „Nie!“ To medveďa naštve a tak sa vymenia. Ježko dupne na plyn a pýta sa medveďa: „Medveď a ty sa bojíš?“ A medveď na to: „Nie!“ A ježko mu hovorí: „No tak to by si sa mal, pretože ja nedočiahnem na brzdu.“', 582, 3.96, 56),
	(13508, '- Viete prečo si slon lakuje nechty?\r\n- ???\r\n- Lebo sa skrýva do lentílok...\r\n- A videli ste už niekedy slona v lentilke?\r\n- ???\r\n- Nie?\r\n- No vidíte ako dobre sa skryl. ', 175, 3.31, 56),
	(13509, 'Veľký kráľ džungle lev ide za zvieratkami a keď začne hovoriť, žaba po ňom všetko opakuje.\r\nLev: Milé zvieratká...\r\nŽaba: Milé zvieratká...\r\nLev: ... dnes sa pôjdeme pozrieť 3 km odtiaľto.\r\nŽaba: ... dnes sa pôjdeme pozrieť 3 km odtiaľto.\r\nLev: ... ale malé zelené otravné zvieratá so sebou neberieme. \r\nŽaba: Chudák krokodíl ako sa len musí cítiť...      \r\n', 391, 4.17, 56),
	(13510, 'Čo robí koala keď horí les?\r\n- Horí tiež.', 47, 3.99, 56),
	(13511, 'Prechádza sa strážnik parku po lese. Zrazu zbadá na zemi mrtvého vtáčika. Príde domov, vtáčika dá do klietky, dá mu tam suchý chlieb a vodu. O chvíľu sa vtáčik preberie, pozerá a vraví: „Mreže, chleba a voda.... ja som asi niekoho zabil.“', 262, 3.73, 56),
	(13512, 'Mamička sa pýta synčeka:\r\n- Prečo otváraš tú konzervu so sardinkami pred akváriom?\r\n- Ukazujem rybičkám čo ich čaká, keď budú zlostiť.', 150, 3.04, 56),
	(13513, 'Poľovník sa vychvaľuje kamarátovi: Ja som sa chystal v sobotu loviť vtáky, ale čo nevidím medveď. Tak som si pripravil pušku, namieril som na medveďa, ale skôr ako som stihol odpáliť, na niečom sa ten medveď pošmykol. \r\nA kamarát mu hovorí: Ja by som sa na tvojom mieste pošťal.\r\nA poľovník: A na čom si myslíš, že sa ten medveď pošmykol?', 367, 3.8, 56),
	(13514, 'Príde malý rotwailer domov a mama sa ho pýta:\r\n- Tak ako bolo v škole?\r\n- Haf-haf.\r\n- A čo cudzie jazyky?\r\n- Miau Miau.', 124, 3.76, 56),
	(13515, 'Ide Janko po les, stretne mravca a pýta sa ho: "A ty mravček? Čo robíš?"\r\nA mravec na to: "Mrznem ty ch*j nevidíš?"', 122, 2.76, 56),
	(13516, 'Nemec, Rus a Slovák sa dohodli, že kto najdlhšie vydrží v mravenisku. Prvý ide Nemec. Po 1 dni vyjde. Potom ide Rus. Vydrží týždeň, dva a odíde. Tretí ide Slovák. Vydrží rok, dva, nakoniec vyjde von a ostatni sa ho pýtajú: \r\n"Ako si tam tak dlho vydržal?"\r\nA on odpovie:\r\n "Zabil som jedného mravca a ostatní mu išli na pohreb."', 350, 3.74, 56),
	(13517, 'Medveď ho má polmetrového, ale chce mať menšieho. Tak ide za lesným šamanom zajacom a pýta sa ho, čo má robiť.\r\n- Choď za líškou a spýtaj sa jej, či ti dá. Vždy, keď povie "nie", skráti sa ti o 10 centimetrov.\r\nMedveď ho poslúchne a ide za líškou.\r\n- Líška, dáš mi?\r\n- Nie a choď preč.\r\nUž ho má 40 cm, ale chce ho mať ešte kratšieho, ide teda opäť za líškou:\r\n- Líška, dáš mi?\r\n- Nie. Už som ti to povedala.\r\nUž ho má 30 centimetrového, ale hovorí si:\r\n- Takých 20 centi, to je taký mužský idol.\r\nTak ide za líškou:\r\n- Líška, dáš mi?\r\n- Veď už som ti povedala, že nie, nie a just nie!', 646, 4.28, 56),
	(13518, 'Malé kuriatko sa pýta praženice:\r\nBrácho, to si ty?', 55, 3.88, 56),
	(13519, 'Má to 4 nohy a 1 ruku. Čo je to?\r\nPitt-bull utekajúci z detského ihriska.', 77, 3.92, 56),
	(13520, 'Reportér dostal úlohu z redakcie urobiť dokument o Slovensku. Napadlo ho teda, že k Slovensku neodmysliteľne patria salaše a bačovia... Vybral sa teda na salaš, stretol tam starého baču a pýta sa ho:\r\n"Bača, nemohli by ste mi povedať dajakú peknú príhodu, čo sa vám stala?"\r\nA bača nato: "Ale hej, raz sa nám tak stratila ovca v lese. Tri dni sme ju hľadali a nemohli sme ju nikde nájsť. Tak keď sme ju potom našli, tak sme ju s chlapmi 3krát poriadne pretrtkali."\r\nReportér je z toho zhrozený, že toto nemôže napísať do novín, a tak bačovi hovorí:\r\n"No tak toto asi nie, nemali by ste ešte inú?"\r\n"Ale jasné, raz sa nám tiež stratilo v lese jahňa. Tiež sme ho s chlapmi tri dni hľadali, a keď sme ho našli, tiež sme ho samou radosťou 3krát poriadne pretrtkali."\r\nNo a reportér zase že nie, že toto nemôže byť, a tak nakoniec hovorí:\r\n"No, bača, tak mi teda aspoň nejakú smutnú príhodu povedzte... Hádam sa pamätáte."\r\nA bača skloní hlavu a ticho hovorí:\r\n"No vieš chlapče, ja som sa tiež tak kedysi stratil v lese..."', 1088, 4.28, 56),
	(13521, 'Zebra si ide urobiť fotku a fotograf sa jej pýta: "Chcete farebnú alebo čierno-bielu fotku?"', 96, 3.77, 56),
	(13522, 'Zajac je na Mount Evereste. Naraz dole zbadá medveďa a kričí naňho: "Medveď poď hore, poď!"\r\nZajac: "Nie, nejdem prečo?"\r\nZajac: "Chcem ti niečo povedať!"\r\nMedveď? "Nie nejdem!"\r\nZajac: "Veď poď, oplatí sa ti to."\r\nMedveď ide hore a kričí zajacovi: "Ja nevládzem, ja idem dole!"\r\nZajac: "Nie, už si v polovici, tak poď!"\r\nMedveď nakoniec vyjde až na vrchol, zadychčaný ako besný pes a hovorí: "No čo si chcel zajac?"\r\nZajac: "Len som ti chcel povedať, aby si tú trávu nejedol, lebo som sa tam vycikal!!!" ', 536, 3.69, 56),
	(13523, 'Jedna lastovička hovorí druhej: "Bude pršať" \r\n"Ako to vieš?" \r\n"Ľudia na nás čumia...', 94, 3.48, 56),
	(13524, 'Viete kedy kura pípne posledný krá ?\r\nV TESCU pri pokladni.', 62, 3.84, 56),
	(13525, 'V lese bol strašný bordel, a tak medveď zakázal rozhadzovať odpadky a vykonávať potreby na verejných miestach. Na druhý deň išiel zajac po ceste a strašne sa mu chcelo sr*ť. Nevydržal to, a tak to vypustil presne v strede cesty. V tom vidí prichádzať medveďa, a tak hovno prikryje rukami.\r\n- Zajac? Čo to zakrývaš?\r\n- Motýľa...\r\n- Tak ukáž... \r\nZajac odtiahne ruky a hovorí:\r\n- Sviňa, uletel... a pozri koľko tu nas*al...', 449, 4.25, 56),
	(13526, 'Mravec hovorí slonovi: "Slonisko postav sa." \r\nSlon: "A to prečo mravček?"\r\nMravec: "Chcem sa pozrieť, či nemáš na sebe moje plavky."', 140, 3.46, 56),
	(13527, 'Každé ráno príde pyšný kohút do kurnáka, nežne pobozká 9 z 10 sliepok a tej poslednej vytrhne 1 pierko. Takto to ide deň za dňom, až to tá desiata sliepka nevydrží a zakričí na kohúta: \'\'Čo to má sakra znamenať?!\'\'\r\nKohút sa k nej nakloní a zašepká jej: \'\'Teba chcem vidieť nahú, bejby!\'', 315, 4.18, 56),
	(13528, 'Hulič trávy chytí zlatú rybku. Rybka mu hovorí: “Pusť ma a splním ti tri priania!”\r\nHulič: ”OK, ušúľaj mi jointa!”\r\nRybka ušúľa, hulič vyhulí.\r\nRybka: “Druhé prianie?”\r\nHulič: ”Ušúľaj mi ešte jedného!”\r\nRybka ušúľa, hulič vyhulí.\r\nRybka: ”A posledné prianie?”\r\nHulič: ”Ušúľaj mne aj sebe!”\r\nRybka ušúľa a zahulia si spolu.\r\nDruhý den príde hulič zasa chytať ryby a z vody na neho volá zlatá rybka: ”Ani nerozbaľuj pruty, už som nám ušúľala!', 514, 4.08, 56),
	(13529, 'Raz v noci vidí zajac medveďa sťatého ako rúra. Keďže mu už dlhšie liezol na nervy, chopil sa ušiak príležitosti a dobil ho palicou. \r\nNa druhý deň zvolá medveď v lese poradu a hovorí: "Včera ma niekto zbil. Neviem, kto to bol, ale pamätám si že mal na hlave nejaké výrastky. " \r\nZajac sa otočí k slimákovi a hovorí: " A si v riti, kamarát... " ', 373, 3.94, 56),
	(13530, 'V akváriu sú dve rybičky a jedna hovorí:\r\nTy si si prdla?\r\nNie, ja si len pískam...\r\nHej, ja som videla odkiaľ išli bublinky! ', 133, 3.89, 56),
	(13531, 'Idú dva ľadové medvede po púšti a jeden hovorí: Páni, tu musela byť poriadna poľadovica, keď to tu tak posypali. ', 123, 3.46, 56),
	(13532, 'Čo sa stane keď sa skríži opica s korytnačkou?\r\nNo predsa záhorák v prilbe.', 82, 3.2, 56),
	(13533, 'Ide had po tráve a stretne ho zajac. Zajac mu vraví: "Had prepáč, že som sa ti vysmieval, že nemáš nohy."\r\n"To je v pohode." vraví had.\r\n"Tak ruku na to" hovorí mu zajac.', 180, 4.21, 56),
	(13534, 'Dvaja muži sa stretnú v krčme a jeden z nich má bundu z medveďa. Druhý sa ho spýta odkiaľ ju má.\r\n"Choď do lesa ku skale, kde býva medveď a zakrič Hu Hu. On je šiši, takže keď vylezie von, tresni ho po hlave palicou, a potom si z neho uši bundu."\r\nNa další deň sa opäť stretnú v krčme a kamarát má po tele samé modriny. Kamarát, ktorý mu dal radu s medveďom sa ho pýta, ako sa mu to stalo. \r\n"Išiel som do lesa ku skale, kde býva medveď a zavolal som Hu Hu a odtiaľ sa tiež ozvalo Hu Hu, tak som zobral palicu... a prešiel ma vlak."', 570, 3.75, 56),
	(13535, 'Viete prečo cigáni nie sú vegetariáni?\r\nPretože neexistuje sójový pes.', 77, 3.98, 56),
	(13536, 'Vlkovi sa narodí dieťa a vraví: Aké pekné oči, aká pekná srsť a aké pekné zuby presne ako ja, a tie uši..... boha zajac.', 132, 3.68, 56),
	(13537, 'Stojí zajac na kopci a kričí na medveďa, ktorý je pod kopcom: "Hej medveď, poď sem hore!"\r\nMedveď: "Nejdem, nechce sa mi."\r\nZajac: "Ale medveď, poď sem hore, niečo ti chcem ukázať."\r\nMedveď: "No tak dobre..."\r\nMedveď vyjde na kopec a zajac mu hovorí: "Medveď, túto malinu nejedz, tú som ocikal."  ', 316, 3.8, 56),
	(13538, 'Otázka: Viete ako v Rusku zabíjajú zajace?\r\nOdpoveď: Jednoducho. Zoberú kameň, nasypú naň korenie, zajac príde, kýchne a rozbije si hlavu.\r\n', 150, 4.15, 56),
	(13539, 'Letel vtáčik svetom,\r\ntrafili ho guľometom.\r\nLetel na mínové pole,\r\nod dopadu od radosti,\r\nrozhadzuje vnútornosti.', 120, 3.84, 56),
	(13540, 'Príde zajac do obchodu a pýta sa: Máte mrkvičku?\r\nPredavač mu odpovie: Nemáme.\r\nNa druhý deň príde zajac znova a pýta sa:  Máte mrkvičku?\r\nPredavač mu odpovie:  Nemáme a ak prídeš aj zajtra, tak ťa zavesím na stenu.\r\nNa tretí deň príde zajac znova a pýta sa: Máte mrkvičku?\r\nPredavač ho chytí a zavesí na stenu. \r\nVedľa zajaca visí obraz prezidenta a zajačik na to: Aj ty si chcel mrkvičku?!\r\n', 424, 3.84, 56),
	(13541, 'Aký je rozdiel medzi manželkou a hrochom?\r\nNo, jedno má veľkú papuľu a tlstý zadok a to druhé žije kdesi v Afrike.', 123, 3.26, 57),
	(13542, 'Zhovárajú sa dve priateľky:\r\n- Dostala si k narodeninám aj nejaké veľké prekvapenie?\r\n- Áno, od teba.\r\n- ???\r\n- Darovala si mi knihu, ktorú som ti ja kúpila na Vianoce pod stromček!', 192, 2.89, 57),
	(13543, 'Myšlienka dňa pre ženy:\r\nŠťastie nezávisí od peňazí. Ale aj tak sa ľahšie plače v limuzíne než v autobuse.', 120, 3.08, 57),
	(13544, 'Keby neexistovala závisť, stačila by jedna žena pre celú dedinu.', 69, 3.07, 57),
	(13545, 'Na súťaži krásy, pri rozhovore: \r\n- Aké sú vaše obľúbené činnosti? \r\n- Musím sa priznať, že veľmi rada spím.\r\n- A keď nespíte? \r\n- No, tak si práve idem ľahnúť! \n', 184, 2.73, 57),
	(13546, 'Odkaz pre FERA TARABU.\r\nPošli ženu a mi jej to urobíme.', 58, 2.97, 57),
	(13547, 'Aký je rozdiel medzi Američankou a Slovenkou?\r\nAmeričanka má na rukách diamantové prstene, na krku perlový náhrdelník a na nohách čižmy z krokodílej kože.\r\nA Slovenka má na rukách dieťa, na krku ožrana a na nohách kŕčové žily. ', 250, 3.21, 57),
	(13548, 'Poznáte tri najrýchlejšie spôsoby šírenia správ?\r\n- telefón\r\n- televízor\r\n- povedať to nejakej žene', 110, 3.11, 57),
	(13549, 'Obrovská výletná loď, v kajute na smrť vystrašená ženská telefonuje na recepciu:\r\n- Pomóc!!! Neviem sa dostať von z kajuty. Som tu uväznená, prosím pomôžte mi!\r\n- Pani, ukľudnite sa, prosím, a pomaly mi vysvetlíte, čo sa stalo.\r\n- Som tu uväznená. Jedny dvere vedu do kúpeľne a na druhých visí kartička s nápisom "Nerušte, prosím!".', 362, 2.94, 57),
	(13550, 'Matka sa pýta dcéry:\r\n- A čo je ten tvoj priateľ zač? Je to poriadny človek?\r\n- Samozrejme, mami. Je príjemný, nefajčí, nepije, má veľmi milú ženu a tri prekrásne deti.', 183, 3.1, 57),
	(13551, 'Viete aký je rozdiel medzi ženou a levom?\r\nLev vás zožerie hneď, ale žena vás žerie celý život.', 105, 3.3, 57),
	(13552, 'Muž so ženou sa stretnú v čakárni nemocnice.\r\n"Na čo čakáte?" - pýta sa muž\r\n"Na odber krvi. Dávajú mi za darovanie 5 dolárov. A vy tiež s krvou?"\r\n"Nie, ja idem darovať spermu. Dostávam za to 25 dolárov."\r\nO týždeň sa stretnú opäť.\r\n"Tak čo, opäť darovať?" - pýta sa jej muž\r\n"Hmmhm" - prikývne žena s plnými ústami.', 350, 3.28, 57),
	(13553, 'Dve ženy ležia v nemocnici vedľa seba.\r\n"Ako si sa sem dostala?" - pýta sa jedna\r\n"Ale zo zvyku..."\r\n"Ako to zo zvyku?"\r\n"Bola som v posteli s mojim mužom a zrazu som pri našich dverách počula šramot. A tak zo zvyku som naňho zakričala \'Rýchlo zdrhni, vracia sa môj starý!\'"', 288, 3.1, 57),
	(13554, 'Na pôrodnici:\r\n- Pán doktor, ja sa tak bojím!\r\n- Pani, nebojte sa. Ako ľahko to vošlo, tak to aj vyjde.\r\n- Preboha, a to mám mať jednu nohu vo vetracom okienku a druhú na volante?', 187, 3.35, 57),
	(13555, 'Prečo stoja v zime ženy so sukňami na autobusovej zastávke s prekríženými nohami?\r\nA vy keď vám hasne v krbe chcete, aby vám  ťahalo do komína?', 155, 2.95, 57),
	(13556, 'Príde muž z maštale do izby a hovorí žene.\r\n"Žena, ten náš býk je nejaký smutný rozmýšľam, že ho zabijem". \r\nŽena hovorí:\r\n"Myslíš, že ho tým rozveselíš?"', 177, 3.12, 57),
	(13557, '- Pani Zlatica, koľko máte rokov? \r\n- Počkajte, musím to vyrátať. Keď so sa vydávala, mala som 20 a manžel 40. Teraz má manžel 70, takže ja mám... 35.', 163, 2.91, 57),
	(13558, 'Volá dievča do rádia:\r\n"Prosím zahrajte pre moju kamarátku, ktorá má rakovinu pesničku \'Už len 22 dní\'."', 114, 2.67, 57),
	(13559, 'Ako sa hovorí kompliment jednookej žene?\r\nTo tvoje krásne očko nemá páru.', 79, 3.33, 57),
	(13560, 'Zraz feministiek v USA, ako prvá vystúpi američanka a vraví: \r\n"Ja som svojmu mužovi povedala, že mu nebudem variť... prvý týždeň pozerám nič, druhý nič, tretí týždeň muž stojí pri sporáku a varí."\r\nNastáva všeobecný potlesk.\r\nOzve sa angličanka: \r\n"Ja som svojmu mužovi povedala, že mu nebudem prať... prvý týždeň pozerám nič, druhý nič, tretí týždeň muž stojí pri vani a perie"\r\nNastáva všeobecný potlesk.\r\nOzve sa slovenka: \r\n"Ja som svojmu mužovi povedala, že mu nebudem variť ani prať... prvý týždeň pozerám nič, druhý nič, tretí týždeň začínam vidieť na ľavé oko".', 638, 3.74, 57),
	(13561, 'Mladá dáma sedí v lietadle pri okne a vraví: \r\n"Aké je to úžasné, ľudia odtiaľto vyzerajú ako mravci!"\r\nMuž sediaci vedľa:\r\n"To sú skutoční mravci, lietadlo ešte nevzlietlo."', 191, 3.75, 57),
	(13562, 'Prečo začali prijímať do armády viac žien ako mužov?\r\nLebo zistili, že metly sú lacnejšie ako stíhačky.                 ', 132, 3.06, 57),
	(13563, 'Aký je rozdiel medzi rádiom a ženou?\r\nŽiadny.\r\nHore sú to samé vlny a dolu nevieš, čo chytíš!', 103, 2.77, 57),
	(13564, 'Priateľka sa chváli priateľke:\r\n- Dnes som padla jednému chlapovi do oka!\r\n- A to už ako?\r\n- Prstom.', 105, 2.78, 57),
	(13565, 'Čo urobí strieborná líška, keď chce mať mladé? \r\nTo isté, čo urobí žena, keď chce mať kožuch zo striebornej líšky. ', 132, 3.4, 57),
	(13566, 'Čo je to 20 žien v termálnom kúpeli?\r\nSlepačí vývar.', 59, 3.77, 57),
	(13567, 'Každých 10 sekúnd sa na svete narodí jedno dieťa. \r\nNájdite tu ženu a zastavte ju.', 89, 3.19, 57),
	(13568, 'Stretnú sa dve priateľky a jedna hovorí druhej:\r\n"Počuvaj ,Jana,koľko si dala za ten krásny kožuch?\r\n"Tri razy!"', 119, 3.21, 57),
	(13569, 'Starší manželský pár sa vyberie na večeru do reštaurácie. Stolujú už zopár hodín a zrazu starej pani vystrelí z taniera kus mäsa a skončí  na jej bielej blúzke. Stará pani zdvihne oči a pošepky hovorí dedovi:\r\n- Vyzerám ako sviňa.\r\nDedo pokýve hlavou a hovorí: \r\n- A ešte máš aj zajebanú blúzku!', 325, 3.57, 57),
	(13570, 'Vracia sa uťahaná žena z práce domov, v rukách tašky s nákupmi. Zrazu pred ňu vstúpi exhibicionista a rozhrnie si kabát. Žena zúfalo vzdychne:\r\n- Bože, ja som zabudla kúpiť vajcia.', 195, 3.31, 57),
	(13571, 'Kedy má ženská medzi nohami najväčšieho vtáka?\r\nKeď šklbe hus.', 71, 3.17, 57),
	(13572, 'Ako urobíš z trojuholníka čiaru?\r\nNo predsa holiacim strojčekom!', 69, 3.07, 57),
	(13573, 'Čo má dievča väčšie v päťnástich ako v deväťnástich rokoch?\r\nMedzierku medzi prsiami.', 97, 3.32, 57),
	(13574, 'Manžel nie je doma a manželka si medzitým kráti čas s pekným milencom. Zahrkocú kľúče... počuť zámok.... manželka schová milenca do skrine vzopne ruky k nebu a prosí. \r\n- Ó bože, urob so mno čo chceš, len nech nás prosím neobjaví môj muž. Je strašne žiarlivý a určite by zabil nielen mňa ale aj môjho milenca. \r\nNa to sa otvoria nebesia a odtiaľ sa ozve. \r\n- Dobre, bude ako chceš, ale za tri roky ťa povolám k sebe... utopíš sa.\r\n- Dobre, dobre, len nech ho prosím teraz nenájde. \r\nVšetko prebehne úplne hladko. Tri roky sa žena nekúpe, iba sprchuje. Nechodí do plavárne, vode sa zďaleka vyhýba. Tri roky ubehnú. Ubehnú štyri, päť. Na svoj sľub aj  zabudla. Po piatich rokoch si kúpi zájazd na okružnú plavbu okolo sveta. Na lodi je veľká zábava, samé ženy, keď zrazu v tom sa začne výletná  loď  potápať. Žena si spomenie na svoj sľub. Pokľakne, vzopne ruky k nebesiam a volá:\r\n- Ó bože, teraz, teraz ma chceš povolať k sebe? Pozri koľko nevinných žien teraz umrie spolu so mou. \r\nNebesá sa opäť otvoria a odtiaľ sa ozve:\r\n- Dva roky. Dva roky mi trvalo, kým som vás, všetky štetky, dostal na túto loď. ', 1195, 3.72, 57),
	(13575, 'Na opustenom ostrove sú černovláska,brunetka a blondínka.Zrazu pred černovlásku vyskočí zlatá rybka a povie:\r\nAk chceš, splním ti želanie.\r\nDobre.Chcela by som byť taká múdra aby som sa dostala z tohto opusteného ostrova.\r\nSplním ti to,povedala rybka.\r\nO chvíľu uvidí brunetka a blondínka černovlásku ako pláva po mori.\r\nTeraz zasa pred brunetkou vyskočí zlata rybka. \r\nAk chceš, splnim ti jedno želanie.\r\nDobre.Chcela by som byť ešte múdrejšia, aby som sa dostala z tohto ostrova.\r\nDobre,povedala rybka.\r\nZrazu blondínka uvidí ako si brunetka postavila plť a vesluje po mori. \r\nNakoniec pred blondínkou vyskočí zlatá rybka a povie: Ak chceš, splnim Ti jedno želanie.\r\nDobre.Chcela by som byť z nich najmúdrejšia aby som sa dostala z tohto ostrova.\r\nDobre,povedala zlatá rybka.\r\nO chvíľu sa blondínka premení na muža a prejde po moste.', 885, 3.24, 57),
	(13576, 'Vieš, prečo sa ženy vydávajú ?\r\nLebo vibrátor neposeká trávnik !', 72, 3.17, 57),
	(13577, 'Život ženy sa delí na tri obdobia:\r\n1. Ide na nervy svojmu otcovi.\r\n2. Ide na nervy svojmu mužovi.\r\n3. Ide na nervy svojmu zaťovi.', 135, 3.1, 57),
	(13578, 'Učiteľ učí hrať ženu tenis. Žena hrá veľmi zle a lopničky odráža za plot. Učiteľ jej hovorí, aby držala raketu tak, ako drží manželové prirodzenie. \r\nAko zázrakom žena začala hrať dobre. Učiteľ jej hovorí, že je šikovná ale nech vyberie raketu z úst a nech ju vezme do ruky.....', 309, 3.35, 57),
	(13579, 'Cestuje 40 ročná panna v trolejbuse. Celá natešená príde domov a hovorí svojej matke: \r\n- Mami, dnes má konečne oslovil mladý, príťažlivý muž v trolejbuse. \r\n- No vidíš, a čo ti povedal?\r\n- \'Uhni ty debil!\'', 224, 3.12, 57),
	(13580, 'Ako žena rozdelí sliepku na dve presné polovice?\r\nPovytiahne si tepláky.', 76, 3.13, 57),
	(13581, 'Přijedou hokejisti z Nagana k prezidentovi do vily,kde pro ně má přichystaný proslov.Bohužel náhle nastydl a poprosil svou ženu aby ho prečetla,a tak tedy začala:\r\n"óóó óóó óóó."\r\nPrezident jí preruší a řekne:\r\n"Ale Dášenko to nečti, to jsou olympijské kruhy."', 287, 3.17, 57),
	(13582, 'Nad otvoreným hrobom neboštíka stojí vdova a narieka:\r\n- Joj, Janooo! Čo si mi to urobiiiil?! Čo si ja, úbohá 28-ročná vdova Jana, bývajúca na Javorovej ulici číslo 107, telefón 165553 počneeeem?!', 212, 2.62, 57),
	(13583, 'Ktoré tri otvory sú na žene najkrajšie?\r\nTie po vidlách.', 61, 3.03, 57),
	(13584, 'Žena myslí buď na nič alebo na niečo podobné.', 51, 3.09, 57),
	(13585, 'Po manželskej hádke hovorí manželka mužovi:\r\n- Nebyť teba, bol by z nás ideálny pár!', 93, 3.02, 57),
	(13586, '- Bože, aká ste krásna, akú máte fantastickú postavu, určite málo jete...\r\n- Nie, veľa kakám!', 103, 3.42, 57),
	(13587, 'Viete, kedy je žena prašivá?\r\nNo keď ide po prachoch.', 57, 3.03, 57),
	(13588, 'Dve 18-nástky sa rozprávajú. \r\n- Máš doma tlačiareň?.\r\n- No pravdaže.\r\n- Tak si vytlač tie jebáky na krku.', 116, 3.19, 57),
	(13589, '- Kde je čaj? - pýta sa Mišo z kuchyne.\r\n- To si celý ty. Nikdy nevieš nič nájsť. Je predsa v krabici od kakaa so sušienkami s nálepkou soľ!', 151, 3.31, 57),
	(13590, 'Viete, aka je priemerná rýchlosť pohybu manželky v supermarkete?\r\n20000 Sk/hod.', 83, 3.07, 57),
	(13591, 'Žena na polícii:\r\n- Chcela by som odvolať to včerajšie udanie o znásilnení, lebo som dodatočne zistila, že sa jedná o veľmi solídneho človeka s veľmi dobrými majetkovými pomermi.', 194, 3.86, 57),
	(13592, 'Dve baby pred kinom: \r\n- Počúvaj, a pustia ťa na ten neprístupný film, keď ešte nemáš ani päťnásť?\r\n- Ale ja aj tak nemôžem, mama mi nechce strážiť dieťa.', 173, 3.3, 57),
	(13593, 'Rozprávajú sa dve priateľky:\r\n- Počula si? Zuza sa vydáva.\r\n- Hej? A za koho?\r\n- Za svojho gynekológa...\r\n- ???\r\n- Je to prvý muž, ktorý do nej skutočne vidí...', 171, 2.99, 57),
	(13594, 'Sedemnásť ročne dievča sedí pri štedrovečernom stole a je strašne smutné. Mama sa jej pýta:\r\n- Prečo si taká smutná?\r\n- Každý niečo dostal, len ja som to nedostala!', 180, 3.05, 57),
	(13595, 'Ako žena schudne za jeden deň sto kilogramov?\r\nRáno je krava, na obed sliepka a večer chrobáčik.', 102, 3.32, 57),
	(13596, 'Krásna dievčina spí a sníva sa jej hrozný sen. Naháňa ju dvojmetrový nahý černoch s vtákom po kolená. Keď už po úmornej naháňačke nevládze, zastane, otočí sa a zúfalo sa pýta:\r\n- Čo odo mňa chcete?\r\n- Viem ja? Vám sa to sníva.', 253, 2.98, 57),
	(13597, 'Viete prečo pozerajú ženy porno až dokonca?\r\nNo lebo čakajú, kedy bude svadba.', 84, 3.19, 57),
	(13598, 'Aký je rozdiel medzi ženou a hmlou?\r\nŽiadny. Keď sa stratí, čaká nás krásny deň.', 90, 3.13, 57),
	(13599, 'Policista na motorce mává na řidičku, aby zastavila. Ta nereaguje, tak ji předjede a přinutí zastavit.\r\n"Madam, vy nevíte, co tento signál znamená?"\r\n"Jistě, že vím, ale tak se přece už dávno nezdraví!"', 219, 3.09, 57),
	(13600, 'Manželka po večeri umýva riady a kričí na svojho muža do obývačky:\r\n"Tak si predstav Ignác, že tá naša dcéra sa dala na šachy."\r\nMuž zdvihne oči od novín  a hovorí:\r\n"To vážne? Ona a šach?"\r\n"Áno. Pred chvíľou volala, že ťahá na E55!"', 261, 3.07, 57),
	(13601, 'Kedy je žena najšťastnejšia?\r\nKeď je rozkvitnutá ako slnečnica.\r\nKedy je slnečnica rozkvitnutá?\r\nKeď je plná semena.', 127, 3.6, 57),
	(13602, 'Proč se ženy drbou na hlavě?\r\nProtože nemají koule!', 56, 3.31, 57),
	(13603, 'Kedy je žena najinteligentnejšia?\r\nPri sexe. Lebo je napojená na hlavný počítač.', 87, 3.17, 57),
	(13604, 'Nejlepší dárek ženské ke čtyřicítce je plynová maska a to ze tří důvodů. Za prvné není vidět její obličej, za druhé, když ráno vstane netáhne jí z pusy a za třetí když jí zacpeš dírku ze spoda masky, tak sebou v posteli mrská jako dvacítka.', 271, 3.16, 57),
	(13605, 'Dvě ženy se nudí, tak se rozhodnou uspořádat párty. Jedna si vezme na starosti jídlo a pití a druhá chlapy. Po týdnu se sejdou.\r\n"Tak co už máš jídlo a pití."\r\n"No jasné, chlebíčky atd."\r\n"A co ty chlapy?"\r\n"No pozvala jsem jich 32."\r\n"Prosím tebe 32"\r\n"No znáš to stejně polovina nepřijde, no to je ale fut ještě 16. No znáš to, povolina se vždycky hned opije, no to je stejně furt 8, no polovina je stejně na nic, no to ale zbývá dva na každou? No já myslela, že se chceš udělat dvakrát!"', 528, 3.16, 57),
	(13606, 'Žena stojí pred zrkadlom a vraví mu:\r\n"Zrkadlo, zrkadlo, povedz mi, kto je na svete  najkrajší!"\r\nA začne sa pred ním nakrúcať. Zrkadlo odpovie rázne:\r\n"Odstúp - nevidím!"', 183, 3.38, 57),
	(13607, 'Aký je rozdiel medzi ženou a koňom?\r\nŽeny nekadia po dvore.', 63, 2.85, 57),
	(13608, 'Čo sa stane so ženou, ktorá namiesto antikoncepčných tabletiek berie tabletky na ukľudnenie?\r\nMá osem detí a vôbec ju to neserie!', 138, 3.47, 57),
	(13609, 'Sklamaná dievčina príde na breh mora s jasným úmyslom spáchať samovraždu. Nevie sa však odhodlať na svoj posledný skok a tak ju nájde okoloidúci námorník. \r\n- Pozri sa, si ešte mladá, bolo by hriechom skoncovať so životom. Ja zajtra odchádzam na dlhšiu plavbu do Austrálie. Môžeš ísť so mnou. Prepašujem ťa na palubu, budem ti nosiť jedlo, postarám sa o teba a ty zas o mňa. Budeme šťastní, neboj... \r\nOna sa nakoniec nechá presvedčiť a ide na loď. Námorník jej každý večer nosí chlebíčky, džúsy a ovocie a súložia každú noc. O päť týždňov však kapitán lode objaví "čierneho pasažiera." \r\n- A ty tu čo robíš?\r\n- Mám takú dohodu s jedným vašim námorníkom. On ma vezie do Austrálie a ja za to s ním spávam...\r\n- Želám ti veľa úspechu, ale mala by si vedieť, že toto je loď pobrežnej hliadky.', 872, 3.17, 57),
	(13610, 'Viete prečo sú nevesty v bielom?\r\nLebo sú súčasťou bielej techniky.', 73, 3.29, 57),
	(13611, 'Rozprávajú sa dve priateľky:\r\n"Ty, vieš čo, môj drahý mi sľúbil, že keď budem v posteli výborná, dostanem mercedes. Ak budem dobrá, dostanem audi. A ak budem priemerná, dostanem golf."\r\n"Hej? A čo si dostala?"\r\n"Kolieskové korčule."', 250, 3.12, 57),
	(13612, 'Prečo ženy po päťdesiatke nemajú menzes?\r\nVšetka krv ide do krčových žíl.', 83, 2.96, 57),
	(13613, 'Prečo majú ženy prirodzenie zvislé a nie vodorovné?\r\nAby im nemľaskalo keď idú po schodoch.', 99, 3.2, 57),
	(13614, 'Viete prečo sa ženy maľujú a voňajú?\r\nLebo sú škaredé a smrdia.', 72, 3, 57),
	(13615, 'Žena je druhý najinteligentnejší tvor po človeku.', 54, 3.18, 57),
	(13616, 'Na svete existujú ľudia a ženy.', 34, 3.08, 57),
	(13617, 'Existují dva druhy žen: rychlé a pomalé.\r\nRychlé jsou behny a pomalé jsou coury.', 86, 2.98, 57),
	(13618, 'Aký je rozdiel medzi tornádom a ženou?\r\nŽiadny! Keď prídu, sú vlhké a divoké a keď odchádzajú, zoberú si všetko so sebou!', 135, 3.58, 57),
	(13619, 'Čo urobí typická žena v prázdnej uzavretej miestnosti s dvoma guľatými balvanmi? \r\nJeden pokazí a druhý stratí.', 121, 3.19, 57),
	(13620, 'Ako má dievča povedať mame, že je tehotné?\r\nMám problém, babi.', 69, 3.32, 57),
	(13621, 'Svatý Petr stojí za branou a hořem přes ní se díva dolú. Najednou zpozoruje velkou bandu ženských. Lekne se, spadne dolú z brany, honem vybehne před branu a zavře jí za sebou.Zavolá smeřem k ženským:\r\n"No, tak takhle by to nešlo, dámy. Udeláme to takhle:Která z vás v živote nebyla nevěrná svému muži, múže pokračovat dál směrem ke mne. Která z vás byt jednou jedinkrát podvědla, otočí se a vyrazí smer peklo."\r\nVšechny ženy se v tu ranu obrátí a dají se na cestu do pekla.Jen jedna jediná pokračuje směrem k nemu.Svatý Petr zařve za temi ostatními:\r\n"A tu hluchou, tu si vemte se sebou!"', 638, 3.06, 57),
	(13622, 'Príde žena k lekárovi a sťažuje sa: \r\n- Pán doktor, mám problém s nadmerným ochlpením. \r\n- A kde to máte, pani? \r\n- Od brady až po gule. A to je ďalšia vec, o ktorej by som chcela s vami hovoriť.', 210, 3.17, 57),
	(13623, 'Koľko aktívnych mozgových buniek má žena?\r\n-3-\r\n1. riadi menštruáciu\r\n2. riadi migrénu\r\n3. prepína činnosť prvých dvoch', 131, 3.21, 57),
	(13624, 'Ide žena po meste, keď k nej pristúpi policajt a diskrétne jej hovorí:\r\n- Slečna, máte odhalený jeden prsník.\r\n- Čo prsník, ale kde mám kojenca?!', 157, 3.17, 57),
	(13625, 'Viete kedy je žena najsvätejšia?\r\nKeď leží na chrbte a príjma telo svojho pána.', 87, 2.85, 57),
	(13626, 'Ženská hovorí: \r\n- Idem na WC a pozerám, na zemi leží 1000 korún. Zohnem sa pre ne, že ich zodvihnem a zrazu cítim, že si ich zarábam.', 145, 3.64, 57),
	(13627, 'Stoja dve slečny v preplnenej električke:\r\n"No nazdar, ako sa máš, už som ťa dlho nevidela."\r\n"Ja, ja budem mať asi dieťa."\r\n"Hej, to je teda dobré, a s kým prosím ťa?"\r\n"No, ja neviem, nejak sa nemôžem ani otočiť!"', 231, 2.94, 57),
	(13628, 'Stretnú sa dve tehotné ženy na ulici a jedna sa pýta druhej:\r\n"Anča, ako sa ti to stalo?"\r\n"Ále, veď vieš, osud."\r\n"O sud? Vážne? Mne o stĺp!"', 153, 2.92, 57),
	(13629, 'Hádaju sa traja chlapi, ktorý z nich ma najmenšiu ženu. Prvý hovorí:\r\n"Moja žena je taká malá, že keď ma štve tak ju strčím do chladničky a mám pokoj."\r\nDruhý hovorí:\r\n"To je nič. Mňa keď žena sere, strčím ju do krabice od topánok, šuchnem pod postel a mám pokoj."\r\nNapokon sa ozve tretí:\r\n"Páni, kde sa hrabú vaše ženy. Moja je taka mala,že keď má krámy tak ju strčím do fixky a týžden s ňou píšem!"', 443, 3.08, 57),
	(13630, 'Viete prečo má žena o jednu bunku väčší mozog ako kôň?\r\nAby sa nenapila z vedra, keď umýva schody.', 109, 2.93, 57),
	(13631, 'Viete kedy môže žena vybrať ruky z drezu, prestať žehliť, prať a upratovať?\r\nKeď privezú uhlie!', 106, 3.1, 57),
	(13632, 'Čo spraví Viagra so ženou?\r\nPostaví ju ku šporáku!', 56, 2.96, 57),
	(13633, 'Žena hovorí mužovi:\r\n"Idem na 5 minút k susedke. A hlavne nezabudni každú polhodinu pomiešať guláš!"', 110, 3, 57),
	(13634, '"Vieš kedy má žena najviac rozumu?"\r\n"Pri milovaní. Vtedy je napichnutá na základňu!"', 92, 3.04, 57),
	(13635, 'Novinár sa pýta Britney Spears, či vie, kto je to William Shaekspare. Britney rozmýšľa a nakoniec novinárovi povie: \r\n- Viete čo, napíšte, že Willy je môj frajer!', 174, 3.12, 57),
	(13636, '- Slečna, vy máte ale krásne prsia. Sú práve? \r\n- Nie, jedno z nich je ľavé. ', 84, 3.01, 57),
	(13637, 'Na púšti stojí strom, na strome sedia tri ženy a pod stromom pobehuje hladný lev. Po troch dňoch spadne prvá a lev ju zožerie. Po ďalších troch dňoch spadne druhá žena a lev ju zožerie. Po nasledujúcich troch dňoch nevydrží ani tretia žena a spadne. Aj tú lev zožerie. Aké plynie z toho ponaučenie? \r\n"Každá sa raz spustí!"  ', 352, 3.31, 57),
	(13638, '"Slečna tie nohavičky si dajte naopak."\r\n"Myslíte tými čipkami dopredu?"\r\n"Nie tým osratým do vnútra."', 110, 3.41, 57),
	(13639, 'Sťažuje sa Jana Martine.\r\nJana: - Zistila som, že môj starý ma podvádza.\r\nMartina: - Tá sviňa!\r\n- Berie mi zo skrine kondómy.\r\n- Tá sviňa!\r\n- Lenže ja som ich všetky poprepichovala.\r\n- Šibe ti, ty sviňa?!', 219, 3.01, 57),
	(13640, '- Keď vám poviem tento vtip, tak vám padnú kozy až po kolená tetuška. Áááá... Vidím, že ho už poznáte.', 117, 2.98, 57),
	(13641, 'Už vymysleli viagru pre ženy.\r\nAby vedeli dlhšie stáť pri kuchynskej linke.', 80, 3.01, 57),
	(13642, 'Hádanka:\r\nCez deň to breše a v noci sa to kúpe. Čo je to?\r\nSVOKRINE ZUBY.', 78, 3.2, 57),
	(13643, 'Hovorí dospievajúci syn otcovi: \r\n- Otec, predajme maminu.\r\n- No počkaj, počkaj, čo to hovoríš?\r\n- No čo. Ja ju už nepotrebujem, ty s ňou aj tak nespávaš a kurvu susedovi živiť nebudeme!', 200, 3.52, 57),
	(13644, 'Lepší vták v hrsti, ako žena na streche...', 46, 3.19, 57),
	(13645, 'Matka dcérke v idúcom vlaku:\r\n"Nevykláňaj sa z okna, lebo ti konár vypichne oko!"\r\n"Ále mami, veď tu sú iba be-be-be-betónové stĺpy."', 144, 3.13, 57),
	(13646, 'V Pražskej električke ktorá je veľmi preplnená a ľuďom trčia nohy z okna. No proste nacpaté ľuďmi. A teraz sa rozprávajú dve češky a tá jedna jej hovorí:\r\n"Anička já budu mít asi s někým děťátko.\r\n"A s kým proboha?"\r\n"Nevím nemúžu se otočit."', 272, 3.19, 57),
	(13647, 'Sťažuje sa susedka kamarátke.\r\n"Tento rok mi vrabce vyzobali skoro všetok mak. Musela som si dať do záhradky strašiaka."\r\n"Ja nemám ten problém. Môj manžel je v záhrade celý deň."', 193, 2.97, 57),
	(13648, 'Dve bývalé spolužiačky sa stretnú v kaviarni a rozprávajú sa:\r\n– Čo teraz robíš moja?\r\n– Vieš, som sekretárka.\r\n– Hej sekretárka? A to čo obnáša?\r\n– No vieš. Ráno uvarím riaditeľovi kávu, napíšem list alebo niečo, čo mi nadiktuje, potom sa pohráme, ideme na obed, niečo napíšem, pohráme sa, je večer a tak ďalej. No a ty čo robíš?\r\n– No vieš, moja, tak ja tiež robím ľahšiu, akurát toho písania toľko nemám.', 461, 3.09, 57),
	(13649, 'Ako sa povie žena troma slovami? \r\nŠkrt cez rozpočet.', 56, 3.06, 57),
	(13650, 'Sedia dve susedy a rozpravajú sa:\r\n- Predstavte si, tá naša Anka má jednotky a maturuje.\r\n- Nebojte sa, ešte jej podrastú.', 128, 3.25, 57),
	(13651, 'Rozprávajú sa dve ženy:\r\n- Keď zomrieš, dáš sa pochovať do jamy, hrobky, či spopolniť? \r\n- Neviem, môj muž mi povedal, aby som sa dala vypchať!', 156, 3.53, 57),
	(13652, '"Mama, mama, našla som 50 korún!"\r\n"Ja som v tvojich rokov stovky nachádzala. A opráš si to seno zo sukne."', 112, 3.09, 57),
	(13653, 'Stretnú sa dve na južnom Slovensku:\r\n"Eržika, dlho sme si nevideli, akú máš?"', 83, 3.02, 57),
	(13654, 'Dcéra sa zveruje matke:\r\n"Aj by som za toho Miša išla, ale zdá sa mi, že je alkoholik."\r\n"Prečo?"\r\n"Dnes som mu sedela na kolenách a ako keby mal vo vrecku pollitrovku."\r\n"Ach ty hlúpa, hneď ho ber! Ja som celý život sedela na ampulke od liekov."', 257, 3.03, 57),
	(13655, 'Stretli sa po rokoch dve kamarátky:\r\n"Ako sa máš?"\r\n"Som vydatá za námorníka, 11 mesiacov sa plaví a na jeden mesiac chodí domov."\r\n"Tak to ťa teda ľutujem."\r\n"Nie je to až také hrozné, dva týždne z toho chodí na návštevu k rodičom."', 252, 3.19, 57),
	(13656, 'Kedy sa stane zo ženy elektrická bomba?\r\nKeď si dá medzi nohy kilovaty.', 75, 2.88, 57),
	(13657, 'Dve ženy boli 10 rokov v base v jednej cele. Po vypršaní trestu obe prepustili v jeden deň. Než sa rozišli, tak pred bránou väzenia sa ešte dve hodiny rozprávali.', 172, 3.26, 57),
	(13658, 'Na trhovisku si jedna zákazníčka vybrala uhorku a predavač jej hovorí:\r\n"Bude to 20 korún, pani."\r\n"Ja nie som pani, ale slečna!"\r\n"Ó prepáčte, mal som ten pocit podľa toho, ako držíte tú uhorku."', 210, 3, 57),
	(13659, 'Štyri dámy sedia pri partii bridžu a šálke čaju. Prvá hovorí: \r\n- Viete, dámy, poznáme sa už tak dlho. Musím sa k niečomu priznať. Som kleptomanka. Už niekoľko rokov. Ale nebojte sa, vám som nikdy nič nevzala.\r\nDruhá sa pripojí: \r\n- No, ja sa tiež musím priznať. Ťaží ma to už dlho. Som nymfomanka, chlapov nestíham\r\npočítať. Ale dala som si pozor, aby som sa vyhla vašim manželom.\r\nTretia po chvíli hovorí: \r\n- Keď sa takto spovedáme, ja sa tiež priznám. Som lesba. Ale vy nie ste môj typ, ja mám rada mladé slečny, nebojte sa.\r\nŠtvrtá vstane a vychŕli: \r\n- Ja sa tiež priznám. Som hrozná klebetnica. A teraz ma ospravedlňte, musím vybaviť pár telefonátov!', 711, 3.28, 57),
	(13660, 'Anča hovorí Jožke:\r\n- Pochovali pána Nováka.\r\n- A čo sa mu stalo?\r\n- Zomrel ty krava!', 91, 3.05, 57),
	(13661, 'Rozprávajú sa dve kamarátky:\r\n- Predstav si, včera ma chcel v parku nejaký týpek pobozkať.\r\n- No a čo si urobila?\r\n- Utekala som, čo mi nohy stačili.\r\n- A dohonila si ho?', 180, 2.96, 57),
	(13662, '- Myslíte si, že ja si ľahnem s každým do postele? Ja to robím hocikde.', 77, 2.93, 57),
	(13663, '"Už si to skúšala s vibrátorom?"\r\n"Nie."\r\n"Tak to ani neskúšaj. Ja som si dnes vybila dva zuby."', 102, 3.08, 57),
	(13664, '"Mamiii, čo je to orgazmus?"\r\n"Neviem, dcérenka, spýtaj sa ocka."', 68, 3.72, 57),
	(13665, 'Poznáme tri druhy žien:\r\n- inteligentné\r\n- krásne\r\n- prevažná väčšina', 78, 3.38, 57),
	(13666, 'Viete, čo sa stane zo ženy, keď použije always s krídelkami a vypije RedBull?\r\nNadzvukove lietadlo.', 104, 3.26, 57),
	(13667, 'Postarší muž v lietadle kričí na blonďavú letušku:\r\n- Rybička poďte sem.\r\nLetuška prišla, samozrejme obslúžila a ako tak odchádzala od starého pána, rozmýšľa:\r\n"Povedal mi, že rybička. Rybička môže byť aj kapor, ale aj šťuka a šťuka má veľké zuby. A veľké zuby má aj kôň. A kôň môže byť aj kobyla a kobyla je ženského rodu, ale ženského rodu je aj suka. Tak on mi vlastne povedal, že som štetka."', 445, 2.88, 57),
	(13668, 'Viete prečo sa nevesty vydávajú v bielom?\r\nLebo biela je štandardná farba kuchynskej a kúpeľňovej techniky.', 115, 3.94, 57),
	(13669, 'Žena hovorí mužovi:\r\n"Odbehnem si na 5 minút k susedke. Nezabudni každú polhodinu pomiešať \r\npolievku."', 111, 3.29, 57),
	(13670, 'Dievčatko sa hrá na piesku s bábikou. Pani ide okolo:\r\n"Akú máš peknú bábiku, Marienka!"\r\n"To nie je bábika, to je potrat!"', 132, 2.87, 57),
	(13671, 'Rozprávajú sa dve susedky.\r\n- Chcem sa rozviesť so svojim manželom.\r\n- Prečo?\r\n- Minule sme boli na víkend na chate, no a ja som sa raz večer išla okúpať do jazera. A môj muž ma sledoval cez ďalekohľad.\r\n- No a čo je na tom také?\r\n- On mal ten ďalekohľad pripevnený na brokovnici.', 299, 2.89, 57),
	(13672, 'Aký je rozdiel medzi dievčaťom z mesta a z dediny?\r\nDievča z mesta má na intímnych miestach pírsing a dievča z dediny kliešťa.', 136, 2.93, 57),
	(13673, '"Mara pod budeme sa milovať."\r\n"Nemôžem."\r\n"Prečo?"\r\n"Za prvé mi to zakazujú rodičia."\r\n"Za druhé mi to zakazuje viera."\r\n"Za tretie som ešte panna."\r\n"A za štvrte ma potom vždy strašne bolia kríže."', 213, 3.09, 57),
	(13674, '- Dúfam, že tu fľašu ste neotvárali iba kvôli mne?\r\n- Pani, skutočne nepoznám iný spôsob, ako dostať víno von z fľaše!', 132, 2.87, 57),
	(13675, '- Chcem sa rozprávať s vašou ženou!\r\n- Keď vás pustí k slovu, nech sa páči!', 84, 3.03, 57),
	(13676, 'Viete ako Boh stvoril ženu?\r\nNajprv stvoril hus, potom sliepku a potom mu došlo perie.', 88, 3.2, 57),
	(13677, 'Čo si myslia ženy, keď pozerajú do stropu?\r\nMilenka: Príde? Nepríde?\r\nProstitútka: Zaplatí? Nezaplatí?\r\nManželka: Vymaľuje? Nevymaľuje?', 147, 3.37, 57),
	(13678, 'Spomienky deväťnásťročnej študentky z plavby do Ameriky:\r\n19. júla: Konečne sme vyplávali, máme pekné počasie...\r\n20. júla: Všimol si ma kapitán...\r\n21. júla: Kapitán mi dal najavo, že keď nebudem jeho, zabije všetkých 500 cestujúcich na palube! \r\nZ 21. júla na 22. júla: Zachránila som život 500 cestujúcim...', 337, 2.8, 57),
	(13679, 'Stretnú sa dve známe:\r\n"Ach, kde ste to boli?"\r\n"V salóne krásy."\r\n"A čo, mali zavreté?"', 94, 3.18, 57),
	(13680, 'Urážajú sa dve ženy. Prvá:\r\n- Ty máš také krivé nohy, že by pomedzi ne prešla aj sviňa!\r\nDruhá:\r\n- Tak prejdi...', 125, 3.42, 57),
	(13681, 'Aka je to absolútna anorektička?\r\nTo je také dievča, ktoré musí dvakrát skočiť do bazéna, aby raz čluplo.', 116, 3, 57),
	(13682, 'Bezdomovec stretne staršiu atraktívnu dámu a hovorí jej:\r\n- Pani, už šesť dní som nič nejedol\r\n- Mať tak vašu vôľu.', 128, 3.03, 57),
	(13683, 'Vieš, čo je 14-12-13? \r\nSomálska sexbomba.', 45, 2.85, 57),
	(13684, '"Marienka, predo mnou nič nezatajíte. Viem o tom, že ste v druhom stave."\r\n"Práve tak, ako vy, milostivá pani!"\r\n"Nebuďte drza! Ja som sa dostala do druhého stavu od môjho manžela, pána veľkomožného!"\r\n"A čo si myslíte, ja od koho?!"', 248, 3.11, 57),
	(13685, 'Kto je to lesbička? Ďalšia zo žien, čo sa snaží robiť mužskú prácu!', 78, 2.97, 57),
	(13686, '- Slečna,vy ste taká štíhla po matke? \r\n- Nie, po tuberkulóze. ', 68, 3.57, 57),
	(13687, 'Vieš, aký je rozdiel medzi telefónnym automatom počas komunizmu a ženou?\r\nDo automatu si hodil 1,- Kčs a mohol si rozprávať koľko si len chcel a žene dáš celú výplatu a musíš byť ticho.', 202, 2.98, 57),
	(13688, 'Na autobusovej zastávke si ráno mladé dievča zapáli cigaretu. Staršia pani rozhorčene poznamená:\r\n"Radšej by som spáchala neveru, ako zapáliť si na ulici."\r\n"Ja tiež, ale teraz musím ísť do práce."', 214, 3.15, 57),
	(13689, 'Viete aký je rozdiel medzi starou ženou a hrochom?\r\nJedno má veľkú hubu a veľkú riť a to druhé žije v Afrike.', 119, 3.19, 57),
	(13690, 'Ide pán po ulici a zbadá na lavičke sedieť prostitútku s rozkročenými nohami a hneď jej hovorí:\r\n- Pani, napravte si sukňu, je vám vidieť pracovisko.', 161, 2.99, 57),
	(13691, 'Novovymenovaná ministerka poľnohospodárstva sa rozhodne, že bude odborníčkou vo svojom fachu a tak navštevuje družstvá a chovné farmy. Je veľmi nadšená tým čo vidí, zrazu sa však zarazene zastaví a pýta sa farmára:\r\n- A táto krava prečo nemá rohy?\r\n- Viete pani ministerka, - úctivo odpovedá jej sprievodca - sú rôzne dôvody, ktoré vedú k zmiznutiu alebo nenarasteniu rohov. Od genetiky až po rôzne záhadné mutácie. Pravdaže, u kráv sú takéto prípady mimoriadne zriedkavé a neboli celkom objasnené, chcel by som však podotknúť, že pred nami stojí kôň.', 600, 3.04, 57),
	(13692, 'V parku:\r\n- Slečna, máte pekného psíka. Môžem si vás pohladkať?', 71, 2.78, 57),
	(13693, 'Ženy sú ako oblečenie. Musíš ich vyskúšať a až potom uvidíš, či sa s nimi oplatí ukazovať na verejnosti. Lenže aj oblečenie treba občas vystriedať.', 165, 2.73, 57),
	(13694, 'Vracia sa žena z poľa domov a vidí, že od Marienky z okna vyskočil Janko a uteká preč. Vbehne do domu a volá: \r\n"Marienka, čo tu chcel Janko?!?"\r\n"Ani neviem, mamička. Pomiloval ma a hneď odišiel."', 209, 2.96, 57),
	(13695, 'V plnej električke, dve slečny:\r\n- Mne sa zdá že som tehotná!\r\n- A kto, je otcom?\r\n- Počkaj, keď sa trocha uvoľní električka, obzriem sa.', 147, 3.02, 57),
	(13696, 'Rozprávajú sa dve priateľky:\r\n- Ako sa tvári tvoj muž pri sexe?\r\n- Ale, stojí vo dverách a blbo čumí.', 110, 3.24, 57),
	(13697, 'Dve ženy sa bavia o práve strávenej dovolenke:\r\n- Tak čo, ako si sa mala pri mori?\r\n- Ale, ani sa nepýtaj. Mala som so sebou úplne zbytočné veci.\r\n- A čo napríklad?\r\n- Manžela a deti!', 194, 3.03, 57),
	(13698, 'Posledná výzva:\r\nManželky, kámošky, frajerky a priateľky odvezte do USA. Európska únia sa chystá utratiť 20 000 kráv.', 128, 2.9, 57),
	(13699, 'Skočia brunetka a blondínka z 11. poschodia. \r\nViete, ktorá dopadne prvá?\r\nBrunetka, lebo blondínka stihne ešte trikrát zablúdiť.', 138, 2.99, 57),
	(13700, 'V noci zvoní telefón a v ňom sa ozve neznámy úchylák:\r\n"Tak čo moja, už si mokrá? Tak Ti ho tam šupnem!" \r\nRozospatá matka odpovedá:\r\n"Prepáčte, ale to asi voláte moju dcéru".', 191, 3.24, 57),
	(13701, 'Manželka pána Nováka príde domov a pýta sa ho:\r\n"Čo robíš v tej komore?\r\n"Fotky" - odpovedá pán Novák.\r\n"A čo takého máš na nich, keď ich musíš robiť potme?"', 176, 3.1, 57),
	(13702, 'Žena si dala bahennú masku. Dva dni vyzerala oveľa lepšie. Potom blato odpadlo...', 85, 3.3, 57),
	(13703, '-To je prekrásny chrt,pani.Naozaj ho chcete predať?\r\n-Musím.Nevyzerám pri ňom dostatočne štíhlo...', 106, 3.13, 57),
	(13704, 'Elegantná a trocha korpulentná dáma sa zastaví pred žobrákom.\r\n-Pani, prosím o pomoc. Už som celé dni nič nejedol.-\r\n-Bože, prečo ja nemám takú pevnú vôľu?-vzdychne si žena.', 191, 3.5, 57),
	(13705, 'Žena si, a na chrbát sa obrátiš.', 36, 3.3, 57),
	(13706, 'Policajt naháňa zlodeja a kričí: stoj zlodej stoj! Zlodej sa otočí a povie:ty stoj teba nikto nenaháňa', 110, 3.24, 57),
	(13707, 'Príde manžel domov a vidí ako si jeho žena búcha prsia o stenu. Pýta sa jej:-Prosím ťa, to čo robíš?-Deti nechcú mlieko ,tak im robím šľahačku.', 159, 3.61, 57),
	(13708, 'Rozprávajú sa dve malé dievčatká o chlapcoch. Prvá sa pýta:\r\n- Ako zistíš, či sa ti nejaký chlapček páči veľmi alebo nie?\r\n- Ja si vyhodím korunku... Keď padne hlava, páči sa mi. Keď padne znak, páči sa mi veľmi. - odvetí druhá - A ty?\r\n- Ja si vyhodím nohavičky... Keď padnú, tak sa mi páči. Ak zostanú prilepené na plafóne, páči sa mi veľmi.\r\n\n', 383, 3.95, 57),
	(13709, 'Aký je rozdiel medzi tortou a ženou???                                     Do torty idú vajíčka a do zeny penis...', 119, 3.44, 57),
	(13710, 'Ja osobne neverím ženám...\r\nA tu už prečo?\r\nA ty by si snáď veril niekomu kto týždeň vkuse krváca a prežije???', 122, 3.71, 57),
	(13711, 'Stretnú sa dve ženské, ktoré sa stále len urážajú. Jedna hovorí druhej: "Ty máš také krivé nohy, že by cez ne prešlo aj tučné prasa!"Druhá na to: "Tak prejdi!"', 177, 4, 57),
	(13712, 'Upratovačka stojí na schodoch, keď z výťahu vystúpi modelka, strekne si voňavku a povie: Londýn05, 35 euro za mililiter.Za ňou vyjde herečka, strekne si voňavku a povie: Chelsea45, 41 dolárov za mililiter.Upratovačka si prdne a povie: "Lidl, brokolica 15sk za kus...', 279, 3.53, 57),
	(13713, 'Šepká snúbenec svojej nastávajúcej:\r\n-"Drahá, zarábam 50 000 korún mesačne. Dokážeš z toho vyžiť?"\r\n-"Ja áno. Ale z čoho budeš žiť ty?"\r\n', 156, 3.39, 57),
	(13714, 'Viete aký je rozdiel medzi ženou a vínom?Čím starší ročník, tým väčšia opica...', 92, 3.33, 57),
	(13715, 'Manžel nie je doma a manželka si medzitým kráti čas s pekným milencom. Zahrkocú kľúče... počuť zámok.... manželka schová milenca do skrine vzopne ruky k nebu a prosí.\r\n- Ó bože, urob so mno čo chceš, len nech nás prosím neobjaví môj muž. Je strašne žiarlivý a určite by zabil nielen mňa, ale aj môjho milenca.\r\nNa to sa otvoria nebesia a odtiaľ sa ozve.\r\n- Dobre, bude ako chceš, ale za tri roky ťa povolám k sebe... utopíš sa.\r\n- Dobre, dobre, len nech ho prosím teraz nenájde.\r\nVšetko prebehne úplne hladko. Tri roky sa žena nekúpe, iba sprchuje. Nechodí do plavárne, vode sa zďaleka vyhýba. Tri roky ubehnú. Ubehnú štyri, päť. Na svoj sľub aj zabudla. Po piatich rokoch si kúpi zájazd na okružnú plavbu okolo sveta. Na lodi je veľká zábava, samé ženy, keď zrazu v tom sa začne výletná loď potápať. Žena si spomenie na svoj sľub. Pokľakne, vzopne ruky k nebesiam a volá:\r\n- Ó bože, teraz, teraz ma chceš povolať k sebe? Pozri koľko nevinných žien teraz umrie spolu so mnou.\r\nNebesá sa opäť otvoria a odtiaľ sa ozve:\r\n- Dva roky. Dva roky mi trvalo, kým som vás, všetky štetky, dostal na túto loď.', 1188, 4.28, 57),
	(13716, 'Viete čo majú ženy v hlave?Mozgožrúta. A viete čo robí? HLADUJE!', 71, 2.41, 57),
	(13717, '- Viete aký je rozdiel medzi ženou a slivovicou ??\r\n- Žiadny!!!\r\n- Čím je staršia, tak tým je z nej väčšia opica!', 123, 3.59, 57),
	(13718, '- Viete aký je rozdiel medzi ženou a cestou?- Žiadny, na obidvoch sa derú gumy. ', 84, 3.71, 57),
	(13719, 'Idú dve blondínky a jedna hovorí druhej: "Pozri na toho holuba s jedným okom."\r\nDruhá blondínka si zakryje oko a hovorí: "Kde?"', 134, 3.56, 57),
	(13720, '- Prečo sú ženské svadobné šaty biele?\r\n- Biela je štandardná farba pre domáce spotrebiče... \r\n', 105, 4.11, 57),
	(13721, 'Žena si vezme muža a dúfa, že sa zmení, ale márne. \r\nMuž si vezme ženu a dúfa, že sa nezmení, ale márne.', 116, 3.3, 58),
	(13722, 'Jde ženská v noci parkem. Najednou se z křoví vyřítí chlap, povalí ji na zem a znásilní ji. Když se zvedá a zapíná si kalhoty, s úsměvem říká:\r\n"Až se to narodí, tak tomu můžeš říkat třeba Franta."\r\nA ta ženská se na něj usměje a říká:\r\n"Až se to projeví, tak tomu můžeš říkat třeba chřipka."', 335, 3.7, 58),
	(13723, 'Viete čo si o sebe myslí každá žena?\r\nŽe má:\r\n- najkrajšie dieťa pod slnkom,\r\n- najhlúpejšieho muža na svete,\r\n- nasledkom čoho má zbabrany život.\n\r\nA čo nemá:\r\n- nikdy dosť peňazí,\r\n- nemá si čo obliecť,\r\n- nikto iný nemá pravdu len ona!', 263, 3.09, 58),
	(13724, '- Slečna, kde sa končia tie vaše krásne nohy?\r\n- Tam, kde sa začínajú vaše záujmy.', 91, 3.31, 58),
	(13725, 'Žena príde ráno domov a povie mužovi, že spala u najlepšej kamarátky. Čo urobí muž? Obvolá tých desať kamarátiek a zistí, že ani u jednej nespala. \r\nMuž príde ráno domov a povie žene, že spal u najlepšieho kamaráta. Čo urobí žena? Obvolá tých desať kamarátov a zistí, že u ôsmich prespal a u dvoch ešte stále je.', 347, 3.8, 58),
	(13726, 'Ide sestrička po nemocničnej chodbe a pred sebou tlačí vozík, na ktorom má tri banky so spermiami. Prejde cez prvé poschodie, druhé a na treťom spoza rohu vyskočí muž s kuklou a samopalom v ruke a zareve na ňu: \r\n"Stoj, čo to vezieš?"\r\nSestrička celá prestrašená mu trasľavým hlasom odpovie, že spermie."\r\nNato kukláč na ňu namieri samopal a kričí:\r\n"Vypi to!"\r\nSestrička s odporom zoberie banku a vypije ju, no kukláč reve znovu:\r\n"Vypi aj tú druhú, lebo ťa zastrelím!"\r\nSestrička s nechuťou vypije druhú banku, no kukláč reve neustále:\r\n"Vypi aj tú tretiu, lebo ťa naozaj zastrelím!"\r\nSestrička zo strachu vypije aj tretiu, nato si kukláč zhodí kuklu - sestrička pozerá, čuduje sa a to jej manžel. Manželovi sa náhle roztiahne úsmev od ucha k uchu a hovorí:\r\n"Noooooo, vidíš, že to ide!"', 847, 3.45, 58),
	(13727, 'Príde muž do kníhkupectva a vraví predavačke:\r\n- Dobrý deň! Máte knihu s názvom "Muž, vládca žien"?\r\n- Prepáčte, ale science-fiction je o poschodie vyššie.', 171, 3.67, 58),
	(13728, 'Vodič vezme do auta stopárku a tá sa spýta:\r\n- A do Košíc je ďaleko?\r\n- Nie, je to celkom blízko - odvetí vodič.\r\nPo polhodine dievčina hovorí:\r\n- Ujko. Ale veď ste povedali, že Košice nie sú ďaleko a ešte stále sme tam nedošli. Tak sú ďaleko alebo nie?\r\n- Teraz sú už ďaleko, dievčička, veru ďaleko.', 328, 3.12, 58),
	(13729, 'Viete, prečo nomôže existovať pekný múdry muž? \r\nLebo to by už bola žena!', 82, 2.78, 58),
	(13730, 'Americký turista v Paríži sa pýta slečny:\r\n- Hovoríte anglicky?\r\n- Tak trochu.\r\n- Koľko?\r\n- 100 frankov.', 111, 3.35, 58),
	(13731, 'Sedí kňaz v spovedelnici a počúva:\r\n- Otče, mám 80 rokov a už som ženatý 50 rokov s mojou ženou. Celý život som jej bol verný, až do včera! Včera som sa vyspal s 20-ročnými dvojičkami!\r\n- Kedy ste boli naposledy na spovedi, dedko?\r\n- Ja? Nikdy! Ja som žid!\r\n- A prečo ste mi o tom prišli porozprávať do spovedelnice?\r\n- Viete, ja sa dnes s tým každému chválim.', 388, 3.7, 58),
	(13732, 'Viete ako sa treba starať o ženy? \r\nAko o kvetinky. Treba ich zviazať, zrezať a hodiť do vody!!!', 101, 3.31, 58),
	(13733, 'Pýta sa jeden chlap druhého:\r\n- Ty a na čo vlastne zomrela Tvoja žena?\r\n- A na čo vlastne žila!?', 102, 3.38, 58),
	(13734, 'Chlapík v aute zastaví peknej stopárke. Po dlhšom čase skončia v lese. Keď je po všetkom chlapík vraví.\r\n- Tak a teraz choď nahá von a urob snehuliaka.\r\nKočka stavia snehuliaka... Celá fialová od zimy sa vráti a pýta sa, prečo ho mala postaviť v takej kose. Chlapík:\r\n- Ja nie som bohužial ktovieako dobrý milenec, ale na to, ako si musela stavať  v zime snehuliaka, len tak ľahko nezabudneš.', 417, 3.53, 58),
	(13735, '"Blahoželám chlapče! Som presvedčený, že po rokoch budeš na tento deň spomínať ako na najšťastnejšiu udalosť tvojho života!" \r\n"Ale strýko, veď ja sa žením až zajtra..."\r\n"Ja viem, práve preto, práve preto!"', 229, 3.33, 58),
	(13736, 'Sú tri fázy v živote ženy, kedy jej muž vôbec nerozumie: \r\nPred svadbou, počas svadby a po svadbe.', 105, 3.23, 58),
	(13737, 'Ples, zábava v plnom prúde.\r\n"Pán Novák, sú len dve veci, ktoré nedovoľujú, aby sa z vás stal výborný tanečník."\r\n"Áno, a ktoré sú to?"\r\n"Vaše nohy."', 166, 3.32, 58),
	(13738, 'Chlapík sa sťažuje svojmu kamarátovi:\r\n- Ja ti mám ale lenivú ženu. Keď som sa včera v noci vrátil z krčmy a chcel som sa vyšťať, tak som zistil, že v dreze nechala neumytý riad.', 194, 3.31, 58),
	(13739, 'Muž sa pozerá ako žena ide piecť koláč a pýta sa jej, že prečo odrezala konce a dala ich vedľa koláča na plech.\r\n"Neviem",odpovedá manželka."Moja mama to tiež tak robila."\r\nKeď išli na návštevu k svokrovcom,tak sa muž pýta ženinej matky, že prečo jej dcéra odrezáva konce koláča a dáva ich vedľa na plech.\r\nSvokra odpovedá:\r\n"Lebo som mala krátky plech".', 386, 3.27, 58),
	(13740, 'Nadránom vytrvalo zvoní na byte zvonček. Manželka otvorí a na chodbe stojí jej úplne nadratý manžel, opretý čelom o zvonček. Usmeje sa na manželku. Manželka sa na neho tiež usmeje a vraví:\r\n- Ale Igorko! Tí tvoji kamaráti sú ale huncúti. Veď ja viem, že ty nepiješ. To ťa oni len nejako opili, aby som ja bola na teba nahnevaná, mne je to jasné. Tí ti to ale vyparatili. Ale ja nie som taká hlúpa. Pod pekne dnu, uložím ťa do postieľky.\r\nManželka vtiahne muža dnu, zavrie dvere, dá mu dole kabát, sako a vidí, že na golieri má stopy od rúžu. Len sa usmeje a vraví :\r\n- Teda, Igorko, tí tvoji kamaráti ! To sú ale čísla ! Čo tí len nevymyslia ! Natreli ti golier rúžom, aby som ja akože aj žiarlila, že ty máš v robote nejakú ženskú. Ale veď ty vieš, že ja nie som taká. No poď, povyzliekam ťa.\r\nDá mu dole gate a keď mu stiahne košeľu, vidí, že má celý chrbát doškriabaný. To sa už na chvílku zarazí, ale usmeje sa a povie :\r\n- Tak to už trošičku, naozaj, tí tvoji kamaráti preháňajú, Igorko. Hodili ťa s holým chrbátikom do kríkov, aby to vyzeralo tak, že ťa doškriabala pri tom, chichi, no veď vieš pri čom, doškriabala nejaká ženská. Ale ja im nenaletim, ja viem, aký je môj Igorko dobrý. No\r\npoď, dáme dole aj slipy.\r\nŽena si k nemu kľakne, dá mu dole slipy a odrazu vidí, že má na vtáku stopy po rúži. To už naozaj stratí reč a len sa na to pozerá. Keď už to trvá istú chvíľu, manžel opitým hlasom prehovorí:\r\n- No? Kombinuj, Marta, rýchlo kombinuj! Inak som v riti!', 1601, 3.74, 58),
	(13741, '"Počul si? Na Nováka sa usmialo šťastie. Zobral si za žénu dcéru miliradára s obrovským venom..."\r\n"A je aspoň pekná?"\r\n"Ani by som nepovedal, lebo vždy keď ide do zoo ukáže sa vrátnikovi, aby ju potom bez problémov nechal vyjsť..."', 250, 3.26, 58),
	(13742, 'Na plavárni hovorí ona jemu:\r\n- Hej! Z plaviek ti trčí šnúrka, strč si ju dnu!\r\n- To nie je šnúrka.', 108, 3.1, 58),
	(13743, 'Pýta sa žena muža:\r\n- Čo by si povedal na to, keby som sa vyspala s niekým iným?\r\n- Na to sa neodpovedá, za to sa len bije.', 130, 2.95, 58),
	(13744, '- Prečo sa nevesty vydávajú v bielych šatách?\r\n- Aby naplno vyjadrili svoju radosť.\r\n- Z toho logicky vyplýva, prečo je ženích v čiernom.', 148, 3.53, 58),
	(13745, 'On a ona v parku. On ju hladká po chrbte a ona sa ho pýta:\r\n- Zlatko, čo robíš?\r\n- Hľadám prsia.\r\n- Ale tie mám vpredu.\r\n- Tam som už hľadal.', 151, 3.75, 58),
	(13746, 'Přijde James Bond do baru a u stolu vidí pěknou holku.Přijde k ní posadí se, obědná pití a řiká:\r\n"Bond, James Bond."\r\nA žena řiká:\r\n"Off, fuck off."', 163, 3.35, 58),
	(13747, 'Príde mladý muž do drogérie a pýta si čierny prezervatív. Predavačka je prekvapená a pýta sa:\r\n- Na čo je vám akurát čierny?\r\n- No viete, idem kamarátovej vdove vyjadriť úprimnú sústrasť.', 207, 3.61, 58),
	(13748, 'V televízii ukazujú ryby. Ozve sa manžel:\r\n"Mala by si si zobrať príklad z rýb a mlčať."\r\n"Aj ty by si si mal zobrať príklad z rýb a piť iba vodu!"', 159, 3.58, 58),
	(13749, 'Hovorí kamarát kamarátovi: \r\n- Včera som stretol v parku prekrásne dievča, ktoré sa tam prechadzalo so psom. Veľmi som sa chcel s ňou zoznámiť a tak som sa jej prihovoril: "Máš prekrásneho psíka. Celý život snívam o takomto psíkovi".\r\n- A čo ona na to? \r\n- Nič. Nechala mi psa a bez slova odišla.', 318, 3.75, 58),
	(13750, 'Cez púšť ide na ťave Arab a za ním beží, ledva zijúc jeho žena. Stretávaju sa s karavánou. Sprievodca karavány sa ho pýta: \r\n- Kde sa tak ponáhľaš? \r\n- Ale žena mi ochorela, tak ju veziem do nemocnice.', 218, 3.29, 58),
	(13751, 'Muž navrhne žene, aby s ním išla do postele za 10 000 Sk. Po krátkej chvíli žena súhlasí, nato hneď muž jej navrhol, či by nešla za 100 Sk. Ona sa naňho pohoršene obráti a povie:\r\n"No dovoľte, za koho ma považujete???!!!"', 239, 3.19, 58),
	(13752, '- Haló, je tam Karol?\r\n- Nie pani, tu žiaden Karol nie je, tu je číslo 5454.\r\n- Prepáčte, ale zasa mi to preskočilo!\r\n- Nič sa nestalo, pani, to sa dá liečiť!', 169, 3.71, 58),
	(13753, 'Otec kominár sedí za stolom so svojou malou dcérkou a tu sa ho ona spytuje:\r\n- Ocko, keď budem aj ja veľká, môžem sa stať kominárkou?\r\nOtec na ňu vyjavené pozrie a odpovedá:\r\n- Zlatko, tak to nie. Kde si prosím ťa videla, že by žena priniesla šťastie?', 270, 3.47, 58),
	(13754, 'Žena sa dala odviezť taxíkom. Keď prišlo na platenie, zistila, že nemá peniaze.\r\nTaxikár nahnevane pribuchol dvere, šliapol na plyn a odviezol ženu na kraj lesa.\r\nNa lúke rozprestrel plachtu.\r\n"Čo chcete robiť? Mám doma tri deti!", preľakla sa žena.\r\n"A ja mám doma šestdesiat králikov. Nepapuľuj a trhaj."', 326, 3.54, 58),
	(13755, 'Jano podozrieva svoju ženu, že ho podvádza. Tak sa jedného dňa rozhodne sledovať ju. Zavolá si taxi, nasadne a hovorí šoférovi, aby sledoval auto jeho ženy. Idú za ňou, až nakoniec jeho žena zastaví pred bordelom a vojde dnu. Jano po prežití infarktového stavu hovorí taxikárovi:\r\n- Počujte. Dám vám 5000, keď pôjdete dnu a donesiete mi moju ženu.\r\nTaxikár odíde, vojde do bordelu a po chvíli vychádza so ženou v náručí, ktorá sa hádže, kope a vrieska, dôjde ku taxíku a hodí ženu dovnútra. Jano na ňu pozrie a hovorí:\r\n- Pane, ale toto nieje moja žena. \r\n- Nie, to je moja. Teraz idem, pre tú vašu.', 647, 3.6, 58),
	(13756, 'Párik v posteli. \r\nOn:\r\n- Spravím ťa najšťastnejšou ženou na svete.\r\nOna:\r\n- Budeš mi chýbať.', 103, 3.57, 58),
	(13757, 'Žena vyčíta mužovi:\r\n- Mohol by si niečo pre mňa spraviť, aby som nemusela stále chodiť domov cez ten les? Večer tam býva tma, čo keď má tam niekto znásilní?\r\nMuž jej z kľudom odpovedá:\r\n- Taká tma ešte nebola.', 231, 3.59, 58),
	(13758, 'Mlada pani sa kúpe vo vani keď v tom zvoní zvonec.\r\nNa rýchlo nemôže nájsť žiadne šaty tak si len prehodí ponožku.Otvorí dvere a tam stojí zízajúci chlap.\r\nOna sa na neho díva a rozčúlene sa pýta:\r\n"Vy ste ešte nikdy nevideli holú ženu?"\r\nOn jej odpoveda:\r\n"Nahú áno, ale chlapa tak hlboko ešte nikdy."', 328, 3.46, 58),
	(13760, 'Žena príde k doktorovi a hovorí:\r\n- Pán doktor, s mojim mužom sa to už nedá vydržať. Ten hulí ako lokomotíva, 80 cigariet denne, smrdí, v byte je smrad a dym, no proste nedá sa to vydržať.\r\nDoktor jej na to:\r\n- No viete, vy ženy máte na mužov strašný vplyv. Skúste nejakú taktiku. Povedzte mu napríklad, že si môže zafajčiť, len keď si splní manželské povinnosti. No skúste, a príďte sa mi o mesiac ukázať.\r\nPo mesiaci príde žena, modriny na rukách, strhaná tvár, proste horor. Doktor sa zľakne:\r\n- Preboha, snáď vás nebije kvôli tomu, že chce cigarety.\r\n- To nie, to nie, ale už sa mi to podarilo zbiť na 20 cigariet denne.', 674, 3.13, 58),
	(13761, 'Mara je po prvý raz tehotná. Po prehliadke u gynekológa sa na konci ešte spýta: \r\n- Viete, pán doktor... môj manžel by chcel vedieť...\r\n- Ja viem, ja viem...  - preruší ju lekár - túto otázku počujem často. Sex v tehotenstve nie je žiadny problém až do ôsmeho mesiaca.\r\n- Ale, pán doktor, manžel chcel vedieť, dokedy môžem kosiť na záhrade trávu.', 374, 3.15, 58),
	(13762, 'Ako sa nazýva choroba šialených kráv v USA?\r\nFeminizmus.', 60, 3.26, 58),
	(13763, 'Muž príde domov udivený:\r\n- Drahá, je to možné, aby náš tamagochi otehotnel?\r\n- Ukáž!\r\nChlap vyťahuje z vrecka \'tamagochiho\', ukazuje displej a na ňom nápis: \'Som tehotná!\'.\r\n- Ty idiot, to nie je tamagochi, to je pager.', 234, 3.37, 58),
	(13764, 'Sekretárka príde ráno do roboty a vidí ako z riaditeľovej kancelárie vynášajú gauč.\r\n- To má byt čo? Som prepustená?', 129, 3.65, 58),
	(13765, 'Medzi manželmi:\r\n"Aby si vedel, na Kanárskych ostrovoch budem chodiť, aby ma všetci videli tak, ako ma Pán Boh stvoril!"\r\nMuž sa na ňu pozrie a povie:\r\n"Hádam sfušoval."', 178, 3.8, 58),
	(13766, 'Novák má už dlhé roky zlozvyk, že každé ráno keď sa zobúdza, oprie sa dlaňou o stenu nad posteľou. Po istom čase je mastný fľak na stene celkom zreteľný a neestetický a tak sa Novákovci rozhodnú byt vymaľovať. Domácich prác sa ujme Nováková. Pozve majstra, taký starší pán, ktorý rad radom vymaľuje kuchyňu, obývačku, chodbu, kúpeľňu, dokonca aj špajz. Zostáva už len spálňa a tak Nováková hovorí:\r\n- A teraz majstre poďte so mnou do spálne, ukážem vám miesto kde môj muž s obľubou každé ráno kladie svoju ruku.\r\nStarý pán šokovaný ponukou ženy, hovorí, že nie je zvedavý.\r\n- No len poďte, to miesto je celkom čierne a už aj vlhké.\r\nMajster sa cíti trápne:\r\n- Viete čo? Ak sa mi chcete poďakovať, mne postačia aj dva deci borovičky..', 809, 3.53, 58),
	(13767, 'Tvoja žena má krámy?\r\nEšte to vidieť?', 42, 2.93, 58),
	(13768, 'Príde muž domov a žena mu hovorí?\r\n- V špajzi nám nejde lampa. Opravíš to?\r\nA muž na to:\r\n- Čo som ja elektrikár?\r\nNa druhý deň príde muž domov. A žena mu hovorí:\r\n- Nejde nám voda. Opravíš to?\r\nA muž hovorí:\r\n- A čo som ja inštalatér?\r\nA na tretí deň príde muž domov a všetko opravené. \r\n- Kto to opravil?\r\n- Sused.\r\n- A čo za to chcel?\r\nA žena hovorí:\r\n- Buď mu dám, alebo zaspievam.\r\n- A čo, zaspievala si mu?\r\n- A čo som ja speváčka? ', 478, 3.68, 58),
	(13769, 'Po milovaní začne mladá dvojica snívať o budúcnosti. Už hovoria o plánoch na manželstvo, keď si dievča vzdychne: \r\n- Musím sa ti priznať, že neviem variť. \r\n- Nevadí, povie chlapec. A ja zasa nezarobím toľko, aby sme sa mohli najesť obaja. ', 259, 3.41, 58),
	(13770, 'Chlapíka dovezú do nemocnice úplne dobitého, sama modrina. Lekári sa ho pýtajú, čo sa mu stalo. \r\n- No, bol som s manželkou hrať golf a ona je len začiatočníčka a odpálila loptičku medzi stádo kráv. Tak som ju šiel hľadať. Až po hodnej chvíli som ju zbadal v zadku jednej z nich. No, a vtedy som spravil tu strašnú chybu! \r\n- A čo ste urobili? \r\n- No, zodvihol som jej chvost a zakričal som na manželku "TÁTO VYZERÁ AKO TVOJA".', 457, 3.62, 58),
	(13771, 'Na ulici stretne dievča chalana a pozdraví ho:\r\nČauko!\r\nOn jej odvetí:\r\nČaupi!', 83, 3.48, 58),
	(13772, 'Nápis na náhrobnom kameni: \r\n"Tu leží moja manželka a ja odpočívam doma v pokoji..."', 91, 3.45, 58),
	(13773, 'Manžele mají výročí svatby. Manžel prinese manželce kytku a vytáhne si viagru a nožík a začne ji rezat. Manželka se ho zeptá, proč si ji nevezme rovnou celou. Manžel odpoví:\r\n"Ale ja ti chci dát jenom pusu."', 224, 3.5, 58),
	(13774, 'Pán Klimo pozrie z okna a vidí, že sused zúrivo bije manželku. Zakričí na neho:\r\n- Čo robíte, pán sused?\r\n- Opravujem práčku.', 137, 3.35, 58),
	(13775, '- Drahý, nevadí ti, že mám malé  prsia?\r\n- Nie. A kde ich máš?', 69, 3.47, 58),
	(13776, 'Starostlivá milenka\r\nBankový lupič hovorí svojej milenke.\r\n"Zajtra idem na akciu s koltom a kalašnikovom."\r\n"To je fajn, že idete traja, miláčik, inak by som sa o teba strašne bála!"', 192, 3.34, 58),
	(13777, 'Dobré: Tvoj manžel sa rozumie ženskej móde.\r\nZlé: Občas si vyskúša tvoje šaty.\r\nEšte horšie: Lepšie mu pristanú ako tebe.', 134, 4.27, 58),
	(13778, 'Slečna, fajčíte?\r\nÁno.\r\nTak sa zohnite.', 43, 2.8, 58),
	(13779, 'Kedy má žena najväčšiu dieru?\r\nKeď jej vykopú hrob.', 58, 3.16, 58),
	(13780, 'Na večierku sa zoznamujú muž a žena, prebieha rozhovor. On sa pýta: \r\n- A vy čo robíte?\r\n- Ja som tlmočníčka. A vy?\r\n- Ja som lekár.\r\n- Gynekológ?\r\n- Nie, ale pozrieť sa môžem...', 193, 3.66, 58),
	(13781, 'Dedko sa v dome dôchodcov sťažuje na svoju babku. \r\n- Nevadí mi , keď mi berie môj dôchodok, keď pije moju slivovicu, ani keď fajčí moje cigarety. Ale čo ma najviac vie naštvať je to, keď sa pri obede smeje na mňa mojimi vlastnými zubami! ', 256, 3.3, 58),
	(13782, '"Dlho som rozmýšľala a dospela som k názoru, že je načase sa tebou rozviesť," hovorí Ráchel Jicchakovi. \r\n"Preboha Ráchel. Po 40 rokoch manželstva? A prečo?"\r\n"Keď si mi za tie roky nikdy nič nekúpil."\r\n"Ale veď si nikdy nehovorila, že máš niečo na predaj!"', 277, 3.13, 58),
	(13783, 'Zúfalá žena, sa pýta svojej priateľky, čo má robiť, pretože jej manžel sa nechce s ňou milovať. Tá jej poradí čierne sexi prádlo a na druhý deň sa jej pýta:\r\n- No ako? Čo na to povedal?\r\n- Opýtal sa, kto zomrel.', 232, 3.39, 58),
	(13784, 'Aká je chtivá žena?\r\nTá, ktorej keď strčíš ruku do nohavičiek, máš pocit, že kŕmiš koňa!', 103, 3.39, 58),
	(13785, 'Príde smutná žena za svojou priateľkou a vraví: \r\n- Ten môj muž sa nechce so mnou milovať a stále si len číta knihu!\r\nPriateľka jej radí \r\n- Skús erotické prádlo!\r\nŽenská sa na druhý deň vráti a kámoška je zvedavá:\r\n- No čo, pomohlo? Bolo niečo?\r\n- Nič, stále ho zaujíma len tá kniha.\r\nTak jej poradí všetky ženské finty na chlapov a hovorí: \r\n- No a budem sa pozerať cez okno ako to dopadne!\r\nTá príde domov a už keď sedí vedľa muža nahá, (ten samozrejme kniha na kolenách a číta) zrazu jej položí ruku na stehno. Kámoška si spokojne pustí telku a už ju to nezaujíma. Na druhý deň sa pýta: \r\n- No aké to bolo?\r\n- Zase nič, stále len tá kniha!\r\n- Čo mi vravíš?  Však som videla, že ti rukou už ide do rozkroku!\r\n- No hej, omočil si prst, otočil stranu a čítal ďalej!', 838, 3.6, 58),
	(13786, 'Emancipace na moravě .Muž sleduje hokejový zápas.Žena natírá střechu.Po chvíli se ozývá pod oknem manželčin prosebný hlas.\r\n"Josefe, až začne přestávka ,zavolej mě prosím sanitku !"', 201, 3.4, 58),
	(13787, 'Pri barovom pulte sedí mladík so slečnou. Mladík sa obráti a vraví:\r\n- Obaja sme tu za rovnakým účelom.\r\nSlečna:\r\n- Jasné. Poď, zbalíme nejaké kočky.', 164, 3.3, 58),
	(13788, 'Dedko budí babku:\r\n- Babka, išiel som na záchod a svetlo sa samé zapálilo a potom samé zhaslo. Nie sú tu duchovia?\r\nBabka nato:\r\n- Ty blbec, zasa si bol srať do chladničky.', 181, 3.38, 58),
	(13789, '- Na čo myslíš?\r\n- Na to, na čo ty.\r\n- Tak dobre, skoč mi do chladničky pre pivo.', 87, 3.21, 58),
	(13790, 'Manželka doma usilovne trénuje kung-fu. Kope, fučí, vzdychá... Muž ju chvíľu pozoruje, potom sa pýta?\r\n- A to ti bude načo dobré?\r\n- Načo? Keď pojdem večer potme domov cez park, uvidí ma nejaký úchyl a bude ma chcieť znásilniť, tak sa ubránim...\r\nMuž ešte chvíľu na ňu pozerá, potom hovorí:\r\n- Myslím, že až taká veľká tma nikdy nebude...', 372, 3.15, 58),
	(13791, '- Drahý, naše deti sú už veľké. Budeme si musieť pred nimi dávať trochu pozor a nehovoriť pred nimi otvorene. Začínajú už kadečomu rozumieť a kladú potom nepríjemné otázky.\r\n- Aké napríklad?\r\n- Napríklad prečo som sa za teba vydala.', 256, 3.23, 58),
	(13792, 'Muž vraví žene, ktorá si už hodinu vyberá topánky:\r\n- Kúp si tieto... \r\n- Preboha, veď také už nik nenosí!\r\n- Tak si vezmi tie druhé!\r\n- Zbláznil si sa?! Veď také nosia teraz všetky ženy!', 205, 3.41, 58),
	(13793, 'Rozprávajú sa traja v krčme, kto má škaredšiu ženu.Prvý hovorí, moja je taká škaredá, že ak vyjde na ulicu, tak všetky deti sa ujdú skryť.\r\nDruhý povie, to je nič, moje je taká škaredá, že ak sa pozrie na mlieko tak v momente skysne.Tretí len mlčíi a nakoniec prehovorí: "Viete čo, ja nebudem vymýšľať prídete ku mne domov a uvidíte."\r\nPrídu domov, muž otvorí pivnicu a kričí na ženu:\r\n"Poď von."\r\nA z pivnice sa ozve:\r\n"A mám si dať aj vrece na hlavu?"\r\n"Nie nejdeme sa milovať, len ťa chcem ukázať kamáratom."', 558, 3.69, 58),
	(13794, 'Viete prečo muži nemajú celulitídu?\r\nLebo je to strašne nechutné.', 71, 3.13, 58),
	(13795, 'Žena mužovi:\r\n"Ty si taký debil, keby bola súťaž o najväčšieho debila, tak skončíš druhý."\r\n"Prečo až druhý?"\r\n"Lebo ty si taký debil!"', 152, 3.6, 58),
	(13796, 'Zo ženského hľadiska delíme mužov do troch skupín:\r\n1. Starí mládenci sú idioti.\r\n2. Ženatí muži sú\r\na) verní - ťuťmáci a\r\nb) neverní - sviniari.', 163, 3.23, 58),
	(13797, 'Medzi manželmi:\r\n- Drahý, chcela by som ísť do Zoo.\r\n- A nebudeš sa v tej klietke nudiť?', 94, 3.36, 58),
	(13799, 'Príde žena domov a vraví mužovi:\r\n"Bola som na výstave penisov."\r\n"A aké to bolo?"\r\n"V pohode, boli tam veľké a krásne, jeden kus za 500$, pre menej majetných také stredné za 200$, a pre tie najnižšie vrstvy za 50$."\r\nMuž na to: \r\n"A taký ako mám ja, si videla?"\r\n"Hej, predávali ich po zväzkoch za 20 korún."', 329, 3.4, 58),
	(13800, '"Dobrý deň slečna. Prosím vás,viete aký je rozdiel medzi dobre prepečením stejkom a veľkým penisom."\r\n"Nie."\r\n"Tak vás pozývam na večeru."', 151, 3.21, 58),
	(13801, 'Stretnutie maturantov po piatich rokoch:\r\n- A ako sa majú naši ostatní spolužiaci? Tí, ktorí neprišli?\r\n- Stano a Jožo sa oženili. Ostatní sa majú dobre.', 164, 3.26, 58),
	(13802, '"Ja si niečo urobím",zvolal manzel.\r\n"Preboha čo?",zľakla sa jeho žena.\r\n"Asi praženicu!"', 95, 3.43, 58),
	(13803, 'Dievča stretne svojho priateľa a pýta sa ho:\r\n- Čo to máš vo vrecku nohavíc? To si mi doniesol tyčinku Snickers, alebo si len taký rád, že ma vidíš?', 161, 3.18, 58),
	(13804, 'Na sude sa spytuje sudca:\r\n- Pán Hladký, prečo ste nepomohli svojej žene, keď sa topila?\r\n- A kto mal vedieť, že sa topí? Vrieskala na mňa ako zvyčajne.  ', 164, 3.06, 58),
	(13805, '- Drahý, od koho si kúpil mäso?\r\n- Od  tvojho  milenca. - zavtipkuje  manžel\r\n- Čo? Rudo robí v  mäsiarstve?', 115, 3.9, 58),
	(13806, 'Aký je rozdiel medzi priateľom a manželom?\r\nŠtyridsaťpäť minút.', 71, 3.2, 58),
	(13807, 'Prečo sa muži chcú oženiť len s pannou?\r\nLebo nemajú radi kritiku.', 72, 3.46, 58),
	(13808, 'Dvaja starý mládenci idú na zábavu.Jeden z nich ide tancovať pre mladú slečnu,ktorej smrdí z úst. On je hovorí:\r\n"Fúj, tebe,ale páchne z papule!"\r\nOna sa naštve a ide si sadnúť. On povie tomu druhému, čo sa stalo a na to mu hovorí:\r\n" To nemôžeš tak. Musíš sa opýtať:Slečinka bolí Vás zúbok?"\r\nIšiel pre ďalšiu, ktorej tiež smrdelo z úst.Pýta sa:\r\n"Slečinka bolí Vás zúbok?"\r\n"Nie ja mám mostík."\r\n"No asi Vám niekto nasral za pilier."', 477, 3.52, 58),
	(13809, 'Prečo slobodné ženy upozorňujú na to, že muži zarábajú viac?\r\nLebo vydáte vedia, že nezáleží na tom, kto koľko zarába, ale kto koľko míňa.', 157, 2.91, 58),
	(13810, 'Viete, prečo nemôže byť žena kominárkou? \r\nVideli ste už ženu, ktorá mužovi priniesla šťastie?', 106, 3.08, 58),
	(13811, 'Jeff stretne v bare Billa. \r\n- Hej Jeff, pamätáš si na tú slečnu, ktorú sme tu videli každý večer a pri ktorej som mal zakaždým erekciu?\r\n- Pamätám, Bill, a čo sa stalo? \r\n- No tak som ju nakoniec pozval na rande a ona súhlasila.\r\n- To je skvelé, Bill, a kedy sa máte stretnúť?\r\n- Stretli sme sa dnes večer, Jeff. Zobral som lepiacu pásku a oblepil som si vtáka okolo nohy a ak by som predsa len mal erekciu a postavil by sa mi, ona by na to nikdy neprišla. Prišiel som ju domov vyzdvihnúť a ona mi otvorila v tých najsexi šatách aké si, Jeff, dokážeš predstaviť...\r\n- A čo sa stalo potom, Bill?\r\n- Kopol som jej do ksichtu!', 659, 3.67, 58),
	(13812, 'Manžel z manželkou sedí v reštaurácii a príde k nemu pekná baba,sadne si mu na kolená a dá mu pusu.Keď odíde žena sa ho pýta čo to malo znamenať.A on jej na to povie:\r\n"Ty máš auto,dom a ja mám milenku."\r\nŽena stíchne.Oproti nim sedí druhý manželský pár.Aj k tomu mužovy príde pekná baba .Sadne si mu na kolená a dá mu pusu.Keď odíde pýta sa žena toho prvého muža :\r\n"To bolo co?"\r\n"To bola jeho milenka."\r\nŽena opät stíchne a po chvíli prehovorí:\r\n"Ale mi máme krajšiu."', 514, 3.51, 58),
	(13813, 'Bavia sa dve priateľky.\r\n- A ako si na tom s tým tvojim?\r\n- Dobre, už spomenul aj manželstvo.\r\n- Naozaj???\r\n- Áno. Povedal, že má ženu a dve deti.', 154, 3.74, 58),
	(13814, 'Príde muž do spálne s kozou v náručí a hovorí:\r\n- Vidíš zlatko, toto je tá krava, s ktorou spávam, keď máš ty krámy.\r\nA žena na to:\r\n- Keby si nebol taky chuj, tak vidíš, že to je koza a nie krava.\r\nMuž:\r\n- A keby si ty nebola taká krava, tak by si videla, že som sa rozprával s kozou.', 308, 3.41, 58),
	(13815, '- Predstav si, mám syna.  4 kg a 55 cm. Poď, ideme to zapiť. \r\n- A čo tvoja žena? \r\n- No tá sa to snáď nedozvie.', 120, 3.16, 58),
	(13816, 'Čo musí urobiť mladý muž predtým než sa ožení?\r\n1. Musí ísť k svojej nastávajúcej a jednu jej streliť. Prečo? Aby videla, že sa jej nebojí.\r\n2. Musí ísť k svojej nastávajúcej a pred ňou si prdnúť. Prečo? Aby videla, že sa jej nehanbí.\r\n3. Musí ísť k svojej nastávajúcej a urobiť sa pred jej očami. Prečo? Aby videla, že je sebestačný!', 374, 3.13, 58),
	(13817, 'Prečo sú mačky lepšie ako muži?\r\n1. Mačky nechodia večer na pivo\r\n2. Mačky nenechávajú zdvihnutú dosku na záchode\r\n3. Mačky nechávajú menej chlpov v umývadle', 173, 2.86, 58),
	(13818, 'Prečo je žena lepšia ako bicykel?\r\n1. Vyskúšaj a uvidíš\r\n2. Žene nemôže upadnúť pedál\r\n3. Keď bicykel nechcene zahne, napácha viac škody ako keď zahne žena\r\n4. Bicykel nevie variť\r\n5. Ženu ti neukradnú, ale bicykel áno\r\n6. Dones si bicykel do postele a uvidíš', 283, 3.02, 58),
	(13819, 'Manžel príde so širokým úsmevom domov a rozradostnene kričí na manželku: \r\n- Žena, bal kufre, vyhral som v KENE 10 miliónov! \r\nA žena sa ho milo spýta: \r\n- Áno zlatko a kam ideme na dovolenku? \r\n- Ja nikde, ale ty pál hneď z môjho života!', 255, 3.53, 58),
	(13820, 'Manželka sa vráti o deň skôr z kúpeľov a doma nájde krásnu, mladú, štíhlu ženu. Skríkne na manžela:\r\nA toto čo má znamenať?\r\nManžel pokojne odvetí:\r\n- To je Vitana, varí za teba.', 198, 3.12, 58),
	(13821, '"Slečna, prečo sa maľujete ?"\r\n"No aby som bola pekná !"\r\n"Hm, a prečo nie ste ?"', 86, 3.48, 58),
	(13822, 'Chlápek si jde koupit dalekohled na loveckou pušku. Prodavač mu jeden ukazuje,nasadí ho na pušku a říka:\r\n"Tenhle je tak silnej, že si múžete prečíst moje jméno na poštovní\r\nschránce u mýho baráku tamhle na kopci."\r\nChlápek teda vystrčí hlaveň z okna a kouká určeným směrem. Najednou se mu na tváři objěví široký úsměv.\r\n"Nad čím se usmívate?"\r\n"Vidím okrem nahého chlapa i nahou ženskou."\r\n"To je blbost, manželka je v práci."\r\nKdyž zjistil, že má chlápek pravdu, je naprosto rozzuřenej. Hrabne\r\nza pult, podáva chlápkovi dve patrony a říka:\r\n"Hele, dám vám ten dalekohled zadarmo, když si vezmete tyhle dve\r\npatrony, napálite mojí ženu do hlavy a tomu chlapovi ustřelíte ptáka!"\r\nChlápek tak kouká přes ten zaměřovač a povída:\r\n"Myslím, že to zvládnu na jednu ranu."', 838, 3.49, 58),
	(13823, 'Ako sa balia baby bez pŕs?\r\nNijako!', 36, 2.95, 58),
	(13824, 'Muž mal už po krk stáleho komandovania od manželky, tak zašiel k psychiatrovi, aby mu pomohol. Psychiater mu poradil, ako si budovať sebavedomie a dal mu knihu o asertivite. Chlap ju v autobuse, cestou domov celú prečítal. Príde domov, vrazí do dverí, pristúpi k manželke, ukáže na ňu prstom a hovorí: \r\n- Odteraz chcem, aby si vedela, že JA som pán v tomto dome a MOJE slovo je zákon! Chcem, aby si mi teraz pripravila dobré jedlo a keď ho zjem, očakávam bohatý dezert. Po večeri mi pripravíš kúpeľ, aby som si mohol oddýchnuť. A po kúpeli, hádaj, kto ma oblečie a učeše?\r\n- Asi niekto z pohrebného ústavu - odvetí mu žena.', 666, 3.34, 58),
	(13825, 'Príde chlap z fitness centra domov a hovorí žene:\r\n- Všetky svaly ma bolia, ale to je dobre. Keď bolia, znamená to, že rastú.\r\nŽena ho kopne medzi nohy a vraví:\r\n- Tak nech rastie!', 190, 3.22, 58),
	(13826, 'Čo urobí muž, keď mu žena počas futbalového prenosu pobehuje pred televízorom?\r\nSkočí do kuchyne a skráti jej reťaz.', 128, 3.19, 58),
	(13828, 'Chlápek v baru povídá pohledné dívce:\r\n- Chtěl bych ti zavolat.\r\n- Fajn, moje číslo je v telefonním seznamu.\r\n- Ale nevím, jak se jmenuješ.\r\n- Jméno je tam taky.', 173, 3.47, 58),
	(13829, 'Drahá ženo,\r\nje mi 54 let, rozhodl jsem se utéct se svou překrásnou 18-letou sexy sekretářkou. Zatímco ty čteš tyto řádky, jsem už pravděpodobně v Grand Hotelu a užívám si života.\n\r\nJen co však dorazí do hotelu, už na něj v recepci čeká dopis od manželky:\n\r\nDrahý muži,\r\ni mně je již 54 let. A zatímco Ty čteš tyto řádky, jsem já se svým nádherným, náruživým 18-letým milencem v Hotelu Hilton a také si užívám. Jako účetní s dlouholetou praxí si jistě dokážeš spočítat, že 18 se do 54 vejde mnohem víckrát než 54 do 18!', 580, 3.51, 58),
	(13830, 'Ráno manžel príde k oknu a hovorí:\r\n"Stará, dnes je krásny deň, dneska by to išlo."\r\n" Ja neviem ,čo hneď skoro vymyšľaš?" pýri sa manželka.\r\n"Neviem na čo myslíš Ty, ale práve som si spomenul, ako si minule\r\nhovorila,že jedného krásneho dňa sa zbalíš a odsťahuješ k svojej matke."', 308, 3.33, 58),
	(13831, 'Muž sedí pred televízorom, pozerá futbal a kričí na ženu:\r\n- Prines mi z chladničky pivo!\r\n- A nejaké čarovné slovíčko nepoznáš?\r\n- Pustím ti?', 158, 3.04, 58),
	(13832, 'Sťažuje sa priateľka priateľovi:\r\n"Rodičia mi dali také hnusné meno Margita."\r\n"To vieš, pozreli na ksicht a dali meno."', 128, 3.31, 58),
	(13833, 'Č sa stane s chlapom, keď mu vyoperujú 90 % mozgu?\r\nBude vykastrovaný.', 74, 3.11, 58),
	(13834, 'Prečo chlapi prdia viac ako ženy?\r\nLebo ženy nedokážu držať klapačku dosť dlho na to, aby vytvorili v tele nejaký podtlak.', 132, 3.14, 58),
	(13835, '- Ty si taký chytrý, taký šikovný, no proste geniálny!\r\n- Ale nie. Ja som normálny, ale ty si hlúpa krava.', 114, 3.46, 58),
	(13836, 'Príde muž domov z krčmy.Zazvoní doma, žena mu otvorí a on jej bez slova jednu takú privesí, že spadne na zem.\r\n"Za čo?",dvíha sa žena zo zeme.\r\n"Šak ty znaš za co!"', 178, 2.8, 58),
	(13837, 'Ide smutný Janko po ulici a stretne ho kamarát Fero.\r\n"A čože si taký smutný?"\r\n"Ále zomrela mi žena. Otrávila sa hubami."\r\n"Nuž príjmi moju úprimnú sústrasť."\r\nPo roku ide opäť smutný Janko po ulici a stretne ho kamarát Fero.\r\n"A čože si taký smutný? Nebodaj Ti zasa zomrela žena?"\r\n"Ej veru že hej. Aj táto sa otrávila hubami."\r\nPo roku ide smutný Janko po ulici a stretne ho kamarát Fero. Už zdiaľky volá:\r\n"Nebodaj ti opäť zomrela žena? Stavím sa, že sa otrávila hubami."\r\n"Ále nie hovorí Janko. Táto ich jesť nechcela. Musel som ju klofnúť lopatou."', 598, 3.01, 58),
	(13838, '- Ty, Dežo, počul si, ževraj jedna žena z piatich je doma týraná?\r\n- Hlúposť. Mal som tri a tĺkol som všetky bez výnimky.', 132, 3.05, 58),
	(13839, 'Ako treba dvoriť jednookej žene?\r\n- Tvoje krásne oko nemá páru.', 68, 3.76, 58),
	(13840, 'Bavia sa dvaja priatelia.\r\n"Vieš aká je najideálnejšia žena?"\r\n"Nie."\r\n"Musí mať tak 110 centimetrov a ploskatú hlavu."\r\n"No tých 110 centimetrov by som aj pochopil, ale tú ploskatú hlavu načo?"\r\n"Aby si si na ňu mohol položiť pivo!"', 248, 3.11, 58),
	(13841, 'Viete prečo sú muži?\r\nLebo vibrátory nevedia kosiť trávu.', 63, 3.01, 58),
	(13842, 'Všade dobre, doma manželka.', 29, 3.42, 58),
	(13843, 'Hovorí muž mužovi:\r\n- Ty počuvaj, vieš o tom že máš nejak málo vápniku?\r\n- A to už prečo?\r\n- Však tak dlho spím s tvojou ženou a parohy ti nenarástli.', 166, 3.18, 58),
	(13844, 'Matka nachytá dcéru v objatí mládenca:\r\n- Okamžite vstaň! - zakričí na ňu.\r\n- Prepáč mama, ale ja som tu bola skôr.', 127, 3.19, 58),
	(13845, 'Kolekcia dámskych nohavičiek: Monday, Tuesday, Wendsday, ...\r\nKolekcia pánskych slipov: January, February, March, ...', 120, 3.44, 58),
	(13846, 'Moja žena jazdí ako blesk. Trafí každý strom.', 50, 2.89, 58),
	(13847, 'Sedí záhorák v krčme, hlava rukou podopretá a nahlas rozmýšľa.\r\n- Keby ti lude nebyli tak závistliví, zlí a lakomí tak by jedna ženská stačila pro celú dedinu.', 175, 3.21, 58),
	(13848, 'V bare pristúpi mladý muž k elegantnej dievčine, ktorá sedí pri pulte sama a pýta sa jej: \r\n- Slečna, môžem vás pozvať na pohárik? \r\n- Na hotel?!? - skríkne celou silou dievčina až spozornia všetci hostia v bare. \r\n- Vy ste ma, slečna, nepochopili. Chcem vás len pozvať na malý drink. - vysvetľuje mladík. \r\n- Chcete ma pozvať na hotel? - kričí ešte pobúrenejšie a hlasnejšie. \r\nĽudia sa otáčajú. Mladý muž, celý červený, zmätene odchádza. Dievčina ho dohoní a šepká: \r\n- Prepáčte, že som vyvolávala rozruch, ale som študentka psychológie a zaujíma ma správanie ľudí v nečakaných situáciach. \r\n- Čože?!! - zreve chlapec na celý podnik - tisícpäťsto korún?', 720, 3.32, 58),
	(13849, 'Žena: \r\n- Miláčik, ohol sa.\r\nMuž: \r\n- Veď som sa oholil ráno.', 67, 2.82, 58),
	(13850, 'Situácia: Dvaja ležia príjemne unavený v posteli.\r\nOn: "Miláčik, čo keby som prišiel zajtra k vám a pred všetkými ťa požiadal o ruku?"\r\nOna: "Hmmm, manžel by asi zúril a deti by sa smiali."', 204, 3.14, 58),
	(13851, 'Stretnú sa dvaja chlapi a jeden hovorí druhému: \r\n- Idem sa rozvádzať so ženou.\r\n- Prečo? - pýta sa ten druhý. \r\n- Je odo mňa vyššia o hlavu!\r\n- Pre taku volovinu?\r\n- Ale keby si tú hlavu videl!', 207, 2.98, 58),
	(13852, 'Svadobná noc. Manžel sa pritiahne k manželke, ktorá má na sebe krásne svadobné šaty. Začne hľadať. Prejde hodina, dve a po tretej hodine nazlostený muž povie:\r\n- Veď aspoň prdni pre lepšiu orientáciu.', 217, 3.49, 58),
	(13853, 'Rozpráva sa mladý párik a chalan hovorí:\r\n"Vieš zlato, my sme ako z príbehu Kráska a zviera, ale ak ti niekto povie zviera, zabijem ho."', 143, 3.11, 58),
	(13854, 'Príde chlapík do drogérie a hovorí predavačke:\r\n- Manželka ma poslala kúpiť tampóny.\r\n- Hmm...a viete aké používa?\r\n- To nie je podstatné. Dajte mi iba balík vaty.\r\n- Nechceli ste tampóny???\r\n- Ja som od nej včera chcel balík cigariet a ona mi doniesla tabak a papieriky, že si ich mám sám ušúlať. Tak ona si dnes tie tampóny ide vyrobiť sama!', 368, 3.05, 58),
	(13855, 'Sudca pri hlavnom pojednávaní sa pýta obžalovaného:\r\n- Prečo ste zabili svoju manželku?\r\n- Lebo povedala, že táto farba je zelená.\r\n- Ale veď je to zelená farba.\r\n- Nie, táto farba je zelenkavá!', 208, 2.84, 58),
	(13856, 'Aký je rozdiel medzi milenkou, manželkou a prostitútkou?\r\nMilenka povie: Ty si UŽ skončil?\r\nProstitútka povie: Ty si EŠTE neskončil?\r\nA manželka povie: Drahý, je načase vymalovať strop.', 197, 3.13, 58),
	(13857, 'Jeden muž mal rád tri ženy a nevedel sa rozhodnúť, s ktorou sa má oženiť. Tak dal každej 5000 doláov, aby s nimi urobili, čo uznajú za najlepšie. \r\nPrvá si nakúpila šaty, kozmetiku, šperky a hovorí: \r\n"Urobila som, drahý, všetko pre to, aby si mal tu najkrajšiu ženu." \r\nDruhá nakupila veci pre neho: \r\n"To preto, drahý, aby si vedel, ako na teba myslim." \r\nTretia vložila peniaze do podnikania a po krátkej dobe priniesla manželovi nazad 10 tisíc: \r\n"Aby si videl, aká som šikovná." \r\nI zamyslel sa a nakoniec si vybral tú s najvačšími prsiami.', 580, 3.29, 58),
	(13858, 'Ktoré štyri zvery má žena v živote najradšej?\r\nLíšku okolo krku, Jaguára v garáži, Vola na montáži a Býka v posteli.', 130, 3.13, 58),
	(13859, 'Pán pri prechádzke parkom zbadal atraktívnu slečnu lížucu zmrzlinu a takto sa jej prihovára:\r\n- Slečna, môžem sa vás niečo opýtať?\r\nOna odpovedá:\r\n- Iste, pýtajte sa.\r\n- Ale bojím sa, že si to budete zle vysvetľovať.\r\n- Už keď ste ma na to dopredu upozornili, tak si to nebudem zle vysvetľovať.\r\n- Dáte mi líznuť?\r\nSlečna mu ponúka zmrzlinu a pán jej hovorí:\r\n- Vidíte, či som vám nevravel, že si to budete zle vysvetľovať?\n', 461, 2.96, 58),
	(13860, 'Aký je rozdiel medzi inteligentnou ženou a Yetim?\r\nYetiho uz dvakrát videli.', 79, 2.69, 58),
	(13861, 'Hovorí manželka manželovi:\r\n- Človek, ktorý nedokáže hovoriť tak, aby mu iní rozumeli, je debil. Chápeš ma?\r\n- Nie, zlatko.', 134, 2.77, 58),
	(13862, 'Čo sa stane chapovi keď mu odoperujú polovicu mozgu?\r\nDostane menštruáciu.', 79, 2.83, 58),
	(13863, 'Viete aký je rozdiel medzi mužom a jogurtom?\r\nJogurt má viac kultúry.', 73, 3.05, 58),
	(13864, 'Aký je rozdiel medzi ženou a vínom?\r\nŽiadny. Čím starší ročník, tým väčšia opica.', 95, 3.18, 58),
	(13865, 'Viete aký je rozdiel medzi mužom a ženou?\r\nŽiadny! Spredu do seba pasujú a odzadu sú rovnakí.', 100, 3.67, 58),
	(13866, 'Príde na mol ožratý muž domov a vraví žene: "Prepáč, že som prišiel neskôr, ale hrali sme šach." \r\nŽena na to: \r\n"Uuurčite šach, veď je z teba cítiť borovičku!"\r\n"A čo má byť zo mňa cítiť? Šachovnicu?"', 227, 2.85, 58),
	(13867, '- Ten môj je ako trabant,\r\nSťažuje sa pani Ščepná.\r\n- Veľa hrmotu a žiadny výkon.', 90, 2.77, 58),
	(13868, 'Príde muž domov a hovorí:\r\n- Kúpil som autorádio.\r\nA žena nato:\r\n- Načo, veď nemáme auto.\r\n- Ja som sa ťa tiež nepýtal načo máš podprsenku.', 154, 3.3, 58),
	(13869, 'Aká je ideálna manželka?\r\nKrásna, hluchonemá, majiteľka pivovaru.', 71, 3.09, 58),
	(13870, '- Ty si na mňa milý, len ked chceš sex!!!\r\n- Náhodou som na teba milá stále!\r\n- No veď práve!', 101, 2.88, 58),
	(13871, 'Slečna, ja Vám poviem taký vtip, že Vám po ňom prsia odpadnú.\r\nAle slečna, ako sa tak na Vás dívam, Vám ho už niekto povedal!', 137, 3.33, 58),
	(13872, 'Boeing spoločnosti Al Italia na parížskom letisku Orly. Pekná pasažierka vybehne z lietadla a beží do kancelárie spoločnosti Al Italia.\r\n- To je škandál! Počas letu ma steward trikrát znásilnil!\r\nÚradník si pozorne prezrie jej letenku a vraví:\r\n- No a čo, slečna? Vari ste so zľavnenou letenkou čakali znásilnenie od kapitána?', 349, 2.98, 58),
	(13873, '- Počul si, že Petrova žena spadla do stavebnej jamy?\r\n- Chudák Peter!\r\n- Ale okoloidúci ju zachránili.\r\n- Chudák Peter!', 127, 2.92, 58),
	(13874, 'Manželia po tridsiatke sa vracajú zo spoločnosti a ukladaju sa k spánku. Muž sa v poslednej chvílke pred spaním vytratí z izby. Dôjde do kuchyne, za chvíľu sa vracia s pohárom a podáva ho žene.\r\n- Čo je to? - pýta sa manželka zmätene.\r\n- Aspirín, proti tvojej bolesti hlavy.\r\n- Ale mňa nebolí hlava.\r\n- Ha! A mám ťa!', 339, 3.68, 58),
	(13875, 'Maminka si všimla, že jej dcére rastú prsia a tak usúdila, že je čas si s ňou prehovoriť o vážnych veciach:\r\n- Drahá, je čas, aby som ti vysvetlila niektoré veci. Napríklad ako sa stane, že maminke začne pod srdiečkom rásť dieťatko.\r\n- Mami, viem, že je to určite hrozne zaujímavé, ale mňa by teraz hlavne zaujímalo, ako sa predstiera orgazmus.', 371, 3.08, 58),
	(13876, 'Žena nastupuje do autobusu, ale má veľmi úzku sukňu a nemôže dosiahnúť na prvý schodík. Tak siahne za seba a o kúsok si povolí zips. Znovu to skúša, ale zas nedosiahne. Tak ešte dvakrát o kúsok stiahne zips, a keď to skúša už po štvrtýkrát, pocíti, ako ju dve ruky chytili za zadok a strčili do autobusu. Naštvaná sa otočí a spustí:\r\n"Pane, nepoznám vás tak dobre, aby ste si mohli dovoliť také veci."\r\n"Madam, ja vás zas nepoznám dosť na to, aby ste mi trikrát rozopli rázporok!"', 521, 4.08, 58),
	(13877, 'Takto podvečer prechádza sama žena tichým parkom, keď vidí, ako oproti nej kráča rezkým krokom chlap v monterkách a s roztiahnutými rukami. Vraví si v duchu:\r\n- Utiecť už nestihnem, aj tak ma chce znásilniť, tak nech mi aspoň nezamaže tie nové šaty, čo mám na sebe, dám si ich radšej dole.\r\nChap je bližšie a ženskú napadne:\r\n- Bože, veď aj podprsenka je nová, nohavičky tiež, dám si ich dole, nech ich nezašpiní!\r\nChap v monterkách je už pri nahej žene a zreve:\r\n- Uhni, šľapka, nesiem sklo!', 533, 3.22, 58),
	(13878, 'Stretnú sa dvaja starí kamaráti v Poluse. \r\n- Tak čo tu ty robíš? - pýta sa jeden. \r\n- Ale... Bol som s manželkou na nákupoch a ona sa mi tu niekde stratila. No a ty čo? \r\n- No predstav si, tiež som bol s manželkou na nákupoch a tiež sa mi stratila. A ako vyzerala tá tvoja manželka? Pohľadáme ich.\r\n- No blond vlasy, 175 cm, prsia trojky, štíhla, mala oblečenú takú peknú minisukňu. A tá tvoja? \r\n- Serme na ňu, ideme hľadať tú tvoju!', 465, 3.04, 58),
	(13879, 'Príde žena do reštaurácie, ale všetky miesta sú obsadené až na jedno miesto vedľa jedného chlapa. Príde k nemu a opýta sa:\r\n"Prosím vás máte tu voľné?"\r\nChlapík povie áno, ale musím vás upozorniť, že keď vypijem viacej ako štyri poháriky som strašne vulgárny. Žena sa pýta:\r\n"Koľko ste vypili?"\r\n"Šesť ty krava jedna."', 351, 2.87, 58),
	(13880, 'Muž sa prechádza po pláži a zrazu počuje krásny žensky hlas: \r\n- Pomóóóc! Pomóóóc!\r\nZačne kričať na topiacu sa ženu:\r\n- Čo sa stalo?\r\n- Topím sa!\r\n- A milovať sa vieš?\r\n- Áno, viem!\r\n- No vidíš, plávať sa trebalo učiť! ', 247, 2.9, 58),
	(13881, 'Rebríček IQ na svete: Na prvom mieste je muž, na druhom delfín, na treťom slon, za slonom je žena ale na ňu sa už tesne tlačí automatická práčka. ', 159, 2.93, 58),
	(13882, 'Ráno sa muž zobudí po strašnej opici. Hrozne ho bolí hlava, za pohár vody by dal poklad a zo včerajšieho večera si vôbec na nič nespomína. Zašmátra vedľa seba na posteli rukou a manželky nikde. Otvorí oči a na poduške lístok: "Za chvíľu prídem, miláčik, milujem ťa!"\r\nVstane, ide do kuchyne a tam už pripravené raňajky, čerstvé pečivo, horúca káva, praženica, slaninka a opäť odkaz: "Dobre ráno, ľúbim ťa!"\r\nNechápavo pokrúti hlavou ale stále si nemôže spomenúť. Vbehne do obývačky a tam jeho syn. Tak spýta:\r\n- Čo sa tu včera stalo?\r\n- Ale, prišiel si domov napitý ako sviňa, ten monokel máš od stolíka, keď si prepadol cez prah dverí, potom si ovracal celú chodbu a nakoniec aj seba.\r\n- No dobre, ale to nevysvetľuje čo sa tu stalo...\r\n- Nakoniec sa mama rozhodla, že ťa vezme do kúpeľne, aby si sa umyl a ty si pri tom začal vykrikovať: Pozor, ruky preč ženská, ja som šťastne ženatý!', 964, 3.57, 58),
	(13883, 'Príde chlapík do zelevocu a hovorí predavačke:\r\n"Strčte si tu mrkvu do zadku!"\r\nPredavačka nechce veriť vlastným ušiam:\r\n"Ako?!"\r\n"Vňaťou von!"', 154, 3.14, 58),
	(13884, 'Vo vlaku:\r\n"Slečna, môžem si prisadnúť?!\r\n"Kľudne, veď sú vaše."', 73, 3.11, 58),
	(13885, '- Jarmilo, ja myslím, že by to dneska šlo.\r\n- A co jako?\r\n- No venku svíti sluníčko, na obloze ani mráček.\r\n- A co by jako šlo?\r\n- Říkalas přece, že se jednoho krásnyho dne sebereš a pujdeš do prdele.', 216, 3.17, 58),
	(13886, 'Nazúrený muž sa pýta manželky:\r\n- Počúvaj ma, kde mame ten čaj?\r\n- Joj aký si ty neschopný. Čo keby si hľadal v poličke pri lekárničke v nádobe, kde je napísané cukor?', 185, 2.97, 58),
	(13887, 'Ako vyzerajú moju rodičia? Moja mama sa od mladosti vôbec nezmenila, ale otcovi sa vlasy presťahovali na bradu.', 115, 2.71, 58),
	(13888, 'Mladík chce zaimponovať na prvej schôdzke, a tak hovorí:\r\n"I love you."\r\nDievča je už skúsenejšia, takže odpovie:\r\n"I love you too."\r\nChlapec je touto pokročilou cudzojazyčnou konverzáciou mierne zaskočený a v rozpakoch zašepká:\r\n"I love you three."', 265, 3.09, 58),
	(13889, '"Slečna, bola by ste veľmi pobúrená, keby som vás chcel pobozkať?"\r\n"Samozrejme. Bránila by som sa zo všetkých síl. Ibaže ja som taká slabá."', 154, 3.04, 58),
	(13890, 'Ako spoznáš, že sa muž chystá povedať niečo múdreho?   \r\nKeď začína rozprávanie vetou: "Raz mi  žena povedala..." ', 127, 2.72, 58),
	(13891, 'Vieš aký rozdiel medzi býkom a volom?\r\nBýk má krúžok v nose a vôl na prste.', 83, 3.06, 58),
	(13892, 'Ako môžete zmeniť mužský mozog na maličký hrášok?\r\nMusíte ho PORIADNE nafúknuť a natrieť na zeleno.', 112, 2.67, 58),
	(13893, 'Ožratý chlapík príde domov nadránom s mladou kočkou. Manželka ho už samozrejme čaká v kuchyni. Kočku teda nechá stáť pri dverách a pošepká manželke: \r\n- Počúvaj, nebuď sviňa, povedz že si sestra!', 218, 3.4, 58),
	(13894, '"Soňa, ty ma podvádzaš!"\r\n"To nie je pravda."\r\n"Ty ma podvádzaš s nejakým Talianom!"\r\n"Tak to už vôbec nie je pravda."', 126, 3.13, 58),
	(13895, 'Horský sprievodca hovorí:\r\n- Keby dámy na chvíľku zmĺkli, počuli by sme hukot vodopádu.', 95, 2.95, 58),
	(13896, 'Pekná žena v minisukni pri bare chce zaplatiť kávu a volá na barmana:\r\n- Mám jednu malú čiernu.\r\n- To vidím.\r\n- A stojí?\r\n- Všetkým naokolo.', 152, 3.35, 58),
	(13897, '"Drahá, po tom víne si mimoriadne opeknela."\r\n"To nie je možné veď som ho ešte ani neochutnala."\r\n"Ale ja už som ho vypil skoro liter."', 142, 3.11, 58),
	(13898, 'Jožo stretne starého kamaráta, ktorý sa vyváža na Porsche.\r\n- Ako si sa dostal k takému faru?\r\n- Ale minule ti stopujem na diaľnici a zastaví mi kočka na Porsche. Chvíľu sa vezieme, ale kedže už bola tma, zastavila na parkovisku, vyšla z auta, dala si dole nohavičky a hovorí mi, že si mám zobrať čo chcem. Tak som zobral to auto.\r\n- To máš pravdu, tie nohavičky ti mohli byť malé.', 407, 2.92, 58),
	(13899, 'Aký rozdiel je medzi manželkou a hmlou?\r\nŽiadny. Obe keď odídu, začína krásny deň!', 91, 3.13, 58),
	(13900, 'Chlapík príde za šéfom a vraví: \r\n- Prosím vás o zníženie platu.\r\n- A prečo chcete, aby sme vám znížili plat? \r\n- No viete, lebo moja žena mi stále hovorí, že keby som toľko nezarábal, tak by ma už dávno opustila!', 234, 3.14, 58),
	(13901, 'Chlap si ide užiť so ženou.  Vletia na to, on sa za tri minúty urobí a ona na neho smutne pozerá. Chlap si to všimne a hovorí:\r\n- No čo čumíš? Mala si na to presne toľko času, čo ja.', 197, 2.9, 58),
	(13902, '- Počúvaj ma. O čom sa ženy rozprávajú, keď sú samé?\r\n- O tom, o čom aj my.\r\n- Hej? Svine. ', 101, 2.98, 58),
	(13903, 'Adam: - Tak chceš byť mojou, alebo nie?\r\nEva: - Ešte si to rozmyslím.\r\nAdam: - Ale ponáhľaj sa, lebo mám aj ďalšie rebrá!', 131, 2.94, 58),
	(13904, 'Na dverách nápis ŽENY. Poteším sa, vojdem dnu... a tam iba samé hajzle.', 77, 3.17, 58),
	(13905, 'On: - Skúsime dnes večer výmenu pozícií? \r\nOna: - To je dobrý nápad. Ty budeš žehliť a ja sedieť na gauči. ', 119, 3.17, 58),
	(13906, 'Hosť na návšteve sa pýta domácej panej:\r\n"Môžem si u vás zapáliť?"\r\n"Cíťte sa tu ako doma!"\r\nHosť si ťažko vzdychol a schoval cigarety do vrecka.', 160, 3.82, 58),
	(13907, '- Ty si naozaj iná ako ostatné dievčatá!\r\n- A aké sú ostatné dievčatá?\r\n- Pekné.', 90, 3.05, 58),
	(13908, 'Žena má v hádke vždy posledné slovo. Každé ďalšie slovo muža je \r\nzačiatkom novej hádky. Existuje však výnimka, keď muž povie:\r\n"Kúp si to!"', 157, 3.06, 58),
	(13909, 'Muž sa jedného večera vráti prv ako obvykle a očividne rozladený. Zaľahol k manželke a začal ju hladkať:\r\n"Daj s tým pokoj! Veď vieš, že teraz nemôžem!"\r\n"Čo ste sa dnes všetky na mňa dohovorili, či čo?"', 224, 3.93, 58),
	(13910, 'Ženy vedia predstierať orgazmus, ale muži predstierajú celý vzťah.', 72, 2.89, 58),
	(13911, 'Mladá dáma v bare kýva na barmana. Ten k nej podíde, ona ho nežne chytí za uško, hladí po vlasoch a sladkým hlasom sa pýta:\r\n"Ty si tu šéf?"\r\nBarman veľavravne odpovedá:\r\n"Možno áno, možno nie."\r\nDievčina ho ďalej hladká a šepce mu do uška:\r\n"A kde je šéf?"\r\n"Príde zajtra"\r\nSlečna mu zmyselne zasunie prst do úst a barman ho pomaličky, v rytme hudby ocucáva.\r\n"Tak mu povedz, že na dámskych toaletách došiel papier."', 450, 3.27, 58),
	(13912, 'Janko a Marienka majú prvé rande. Jankovi sa chce na záchod, ale ako hanblivý chlapec, hanbí sa to Marienke povedať. Tak nakoniec hovorí:\r\n"Vieš čo Marienka? Ja si tuto za roh odskočím na 5 minút zatelefonovať."\r\n"No dobre Janko, tak kým ty budeš telefonovať, tak ja si zatiaľ odskočím na záchod."', 317, 2.69, 58),
	(13913, 'Romantická prechádzka lesom. Ona hovorí: \r\n- Cítim sa byť taká naplnená. \r\nOn jej na to: \r\n- Čoby nie, veď si celý deň nebola na záchode.', 149, 2.99, 58),
	(13914, 'Prisahá snúbenec svojej vyvolenej:\r\n- Drahá, sľubujem ti, že so mnou budeš žiť ako v raji.\r\n- Ďakujem. Mám tomu rozumieť tak, že nebudem mať čo na seba?', 166, 3.14, 58),
	(13915, '"Tá moja žena je ale pekná šlapka! Keď som sa vracal zo služobnej cesty, ešte som aj telegram poslal, a aj tak som ju našiel s milencom.", sťažuje sa priateľ priateľovi. Potom sa zamyslí a dodáva:\r\n"A možno ani nie je šlapka, možno len nedošiel ten telegram."', 277, 3.09, 58),
	(13916, 'V predvečer 15-tého výročia svadby v spálni. Manželka rozmýšľa:\r\n"Ktovie, či si spomenie, že zajtra máme 15. výročie?"\r\nA manžel rozmýšľa:\r\n"Keby som ju vtedy uškrtil, zajtra by ma prepustili."', 212, 3.36, 58),
	(13917, 'Američan, Francúz a Slovák sa chvália, aký má veľký zadok ich manželka.  Američan hovorí: \r\n- Moja manželka má taký veľký zadok, že je jej posteľ malá.\r\nFrancúz povie: \r\n- Moja manželka ho má taký veľký, že neprejde cez zárubňu najširších dverí.\r\nA Slovák nato: \r\n- Moja manželka má modré oči. \r\nTí dvaja prekvapene vravia: \r\n- A čo má byť?\r\nSlovák odpovie: \r\n- No to ostatné je zadok.', 428, 3.44, 58),
	(13918, 'Proti manželskému páru jdou 3 ženy. Manžel říka: \r\n"Ta první, to je milenka našeho ředitele. Ta druhá, to je milenka zástupce ředitele. Ta třetí, to je moje milenka".\r\nŽeny přejdou a manželka odvetí: "Ale stejně, ta naše je nejhežčí."', 258, 3.14, 58),
	(13919, 'Manželia sa po piatich rokoch prebudia spoločne v posteli a žena sa spýta manžela: \r\n- Čo sa ti preboha snívalo? V noci si ma bil, sproste mi nadával a pľul si na mňa!!!\r\n- Ja som nespal!', 197, 2.97, 58),
	(13920, 'Žena nájde chlapa, ktorý vykopáva jamu a začne vyzvedať:\r\n- Hmmm, hľadáte zakopaný demižón?\r\n- Nie. Zabudol som svokre dať dole náušnice!', 151, 2.98, 58),
	(13921, 'Žena celý deň pripomínala mužovi, že večer pôjdu na návštevu, aby si \r\nnezabudol vymeniť ponožky. Na návšteve ňuchá, ňuchá a hovorí:\r\n"Starý, že ty si si tie ponožky nevymenil!"\r\n"To som vedel, že mi nebudeš veriť! Tu sú tie staré."', 259, 3.1, 58),
	(13922, 'Spor o dieťa po rozvode. Žena vyhlasuje:\r\n- To dieťa som napokon priviedla na svet ja!\r\nManželov argunent:\r\n- Keď vhodím do automatu peniaze a vypadnú mi cigarety, komu patria? Mne alebo automatu?', 203, 3.23, 58),
	(13923, '"Drahý, videl si toho pána, čo ma vytiahol z vody, keď si ma tam nechtiac zhodil?"\r\n"Ale áno, a celý deň sa mi za to ospravedlňoval."', 141, 3.04, 58),
	(13924, 'Môže žena dráždiť muža aj v 50-ke?\r\nMôže. Každým slovom.', 67, 2.93, 58),
	(13925, '15. výročie svadby, prebieha milostný akt, zrazu sa manžel pýta:\r\n"Drahá čo sa Ti stalo?"\r\n"Prečo?"\r\n"Pohla si sa."', 123, 3.19, 58),
	(13926, '15. výročie svadby, manžel skrčený ráno o tretej chodí po kuchyni, manželka sa ho pýta:\r\n"Co je Ti drahý ?"\r\n"Miloval by som sa."\r\n"Vsak pod."\r\n"Ďakujem, ja to radšej rozchodím."', 191, 3.15, 58),
	(13927, 'Muž priniesol domov kyticu ruží.\r\n"No a čo, to mám hneď roztiahnuť nohy?"  -kričí žena.\r\nMuž je prekvapený - " Prečo? To nemáme doma žiadnu vázu?"', 162, 3.21, 58),
	(13928, 'Žena kričí:\r\n"Pomoc, zhltla som ihlu!"\r\n"Čo kričíš, tu máš druhú!" -  zlostí sa muž.', 96, 3.31, 58),
	(13929, 'Sedí párik vonku na lavičke a zchladilo sa. Peter sa nesmelo opýta partnerky:\r\n"Mám strašne studené ruky, mohol by som si ich trošku zohriať medzi tvojimi stehnami ?"\r\nPartnerka mu odvetí:\r\n"Ale, samozrejme."\r\nPo chvíle zohrievania sa pýta partnerka:\r\n"Peter, nemás tiež studené aj uši ...?"', 307, 2.73, 58),
	(13930, 'Veľký rýbar sa chváli v krčme že sa oženil a ostatný sa ho pýtajú :\r\n"Tak čo, pomiloval si ju ?"\r\n"Nie, nedá sa,má kvapavku."\r\n"Tak aspoň ti vyfajčila ?"\r\n"Nie v ústach ma nejaké vredy."\r\n"No tak aspoň ti onanuje?"\r\n"Ani to nie, má na rukách plesne."\r\n"Tak potom načo si si zobral takú ženu?" \r\n"Noo, keby ste videli aké sere červíky !"', 362, 2.85, 58),
	(13931, 'Nahnevaný muž nesie ženu k oknu a ide ju vyhodiť. Predtým jej povie:\r\n- Buď rada, ty čarodejnica, že ťa púšťam na slobodu. Iný by ťa zabil.', 153, 3.23, 58),
	(13932, 'Hovorí muž žene:\r\n"Pani. V autobuse sa musíte držat rúry!"\r\n"A veď sa aj držím."\r\n"No dobre, ale ja chcem vystupovať."', 128, 3.28, 58),
	(13933, 'Muž dôjde večer domov z práce a vraví svojej žene: \r\n- Miláčik, ty máš nové šaty, že?\r\n- Áno, mám. \r\n- Mám chuť ich z teba ihneď strhnúť - vraví manžel. \r\n- To som v nich taká sexi?\r\n- Nie, sú také otrasné ty koza.', 240, 2.66, 58),
	(13934, 'Muž mal šesť detí a bol na to veľmi hrdý. Bol tak hrdý, že začal svoju manželku nazývať "Matka šiestich", aj keď jej sa to nepáčilo. Jedného dňa, keď išli spolu na zábavu, muž sa rozhodol, že je už čas ísť domov a tak pred všetkými nahlas zakričal: \r\n- Môžeme už ísť domov, Matka šiestich?\r\nJeho žena rovnako hlasne odpovedala: \r\n- Hocikedy, keď budeš pripravený ísť, Otec štyroch!!!', 426, 3.46, 58),
	(13935, 'Ide Janko s Marienkou na bicykloch do lesa. Idú, idú a Marienka padne. \r\n- Janko, ja som si odrela kolienko.\r\n- Drž hubu, ja mám gule v reťazi.  ', 150, 2.8, 58),
	(13936, 'Prečo muž vždy pri milovaní dostane geniálne myšlienky?\r\nLebo je zastrčený do génia.', 93, 2.68, 58),
	(13937, 'Viete, aká žena je najlepšia?\r\nHluchonemá masochistka.\r\nAk jej vynadáte, tak vás nepočuje a ak ju zmlátite tak sa ešte aj poteší.', 140, 3.17, 58),
	(13938, 'Miloval sa Janko s Marienkou. Janko spravil "uh uh". Marienka sa pýta:\r\n- Janko, už si sa odbavil? \r\nNato Janko:\r\n- Nie, prešiel má bicyklista.', 147, 3.14, 58),
	(13939, '"Člověk, který nedokáže mluvit tak, aby mu ostatní rozuměli, je idiot. Chápeš mě miláčku?"\r\n"Ne,drahá!"', 116, 3.06, 58),
	(13940, 'Muž sa sťažuje lekárovi, že má obrátený krvný obeh. \r\n- Takú chorobu nepoznám. Ako sa to u vás prejavuje? - pýta sa lekár. \r\n- Kedysi, keď ma žena pohladila po vlasoch, postavil sa mi. Dnes, keď mi ho pohladí, zježia sa mi vlasy.', 248, 3.29, 58),
	(13941, 'Ak si chce muž udržať ženu, nesmie jej dať všetky peniaze.', 64, 2.89, 58),
	(13942, 'Sedia v metre vedľa seba muž a žena. Zrazu sa začne muž odťahovať od ženy. Pohoršená žena sa rozčuľuje: \r\n- Čo sa odo mňa odťahujete? Veď je to parfém rovno z Paríža za 5000 korún!\r\nPo chvíli sa začne žena odťahovať od muža. On na to: \r\n- Čo sa odo mňa odťahujete? Veď je to kilo fazule za 40 korún!', 331, 2.99, 58),
	(13943, 'Jedného dňa išiel autom muž so ženou, po poľnej ceste, keď odrazu sa nečakane prihnal obrovský hurikán, porozbíjal na aute všetky sklá, vyfúkol všetky veci z interiéru, dokonca aj odniesol obom šaty, až nakoniec skončilo auto prevrátene niekde v priekope. Muž, zakliesnený o volant, bez akejkoľvek šance sa odtiaľ dostať, kričí na ženu:\r\n- Choď zavolať pomoc!\r\nOna je bezradná:\r\n- Pochop, ako môžem takto, keď som nahá, ísť po pomoc?\r\nMuž si teda vyzuje topánku, čo mu jediná zostala, a podá jej ju, nech si s ňou zakryje intímne partie. Takto sa žene podarí zastaviť okoloidúceho pána na aute. Ten vystúpi a ona na neho kričí:\r\n- Vďaka bohu! Pomôžte nám, prosím! Môj muž je tam vnútri!\r\nChlapík si ju premeria skúmavým pohľadom a hovorí: \r\n- Obávam sa, pani, že keď je tak hlboko, už mu nič nepomôže!', 874, 3.33, 58),
	(13944, 'Už starší manželé leží takhle večer v posteli, manželka si čte knížku, manžel se chystá usnout a v tom mu žena povídá:\r\n"Taky by jsi mi mohl jednou říci něco milého, něco něžného."\r\n"A co by to jako mělo bejt?"\r\n"Třeba, že jsem tvúj poklad nejdražší."\r\n"No tak jsi múj poklad nedražší."\r\n"Že jsem tvoje zlatíčko jediné."\r\n"No tak jsi moje zlatíčko jediné."\r\n"No a teď si vymysli něco sám."\r\n"Dobrou noc Božka."', 457, 3.14, 58),
	(13945, 'Vojde žena do vlaku, posadí sa oproti mužovi čo číta noviny, vyberie z košíka melón, roztiahne nohy a začne jesť. po chvíli muž zloží noviny a hovorí:\r\n"Pani, že tu žeriete ako prasa a mliaskate ako teľa mi až tak veľmi nevadí! Ale aspoň by ste si mohli kultúrne sadnúť a dať nohy spolu."\r\n"To by sa vám hodilo. Ja dám nohy spolu a všetky muchy sa vrhnú na dyňu."', 395, 3.01, 58),
	(13946, 'Manžel sa pýta urazenej ženy:\r\n- Ako môžeš tvrdiť, že som prišiel domov opitý?\r\n- Pretože si nútil nášho kanárika, aby spieval dueto s kukučkou v hodinách!', 172, 3.14, 58),
	(13947, 'Ide dedko s babkou po lese a zrazu dedko hovorí:\r\n"Babka vyzliekaj tepláky!"\r\n"Ale dedko, teraz a tu?"\r\n"Nepýtaj sa tak hlúpo a vyzliekaj."\r\nBabka si tepláky vyzliekla, dedko jej ich vytrhol z ruky, obliekol si ich a hovorí:\r\n"Ej, ale sa ochladilo."', 255, 2.82, 58),
	(13948, 'Muž a žena, ktorí sa nikdy predtým nevideli, sa stretnú v jednom kupé lôžkového vozňa. Po počiatočných rozpakoch sa dohodnú, že žena bude späť na hornom lôžku a muž na dolnom lôžku. Uprostred noci sa žena nakloní dole a budí muža:\r\n- Prepáčte, že vás otravujem, ale je mi strašne zima. Mohli by ste ísť požiadať sprievodcu o ďalšiu deku?\r\nMuž sa tiež nakloní, pozrie hore a s leskom v očiach hovorí:\r\n- Mám lepší nápad... Predstierajme, že sme manželia!\r\n- Prečo nie? - zachichoce sa žena.\r\n- Dobre - hovorí muž, - tak neotravuj a choď si ju vypýtať sama!', 611, 3.67, 58),
	(13949, 'Janko a Marienka idú po lese , ked sa Marienka vyzlečie a povie:\r\n"Janko, môžeš ma poznačiť na celý život."\r\nJanko neváhal, vzal drievko a vypichol Marienke oko.', 171, 3.28, 58),
	(13950, 'V lietadle sa rozsvieti červené výstražné svetlo a v zápätí sa ozve kapitánov hlas:\r\n"Vážený cestujúci, vypadli nám motory, pripútajte sa prosím, o 10 minút havarujeme do mora."\r\nŽena sediaca vedľa svojho manžela zrazu vyskočí zo svojho miesta, strhne zo seba blúzku a hovorí manželovi:\r\n"Tak a teraz mi posledný krát dokáž, že som žena!"\r\nMuž sa postaví, zoblečie si košeľu, podá jej ju a hovorí:\r\n"Tu máš a oper mi ju!"', 461, 3.29, 58),
	(13951, '- Tak čo, ako dopadlo to tvoje stretnutie naslepo?\r\n- Ani sa nepýtaj... Tá ženská prišla na rande na Mercedese, rok výroby 1937.\r\n- No to je fajn. Drahé a luxusné auto, dokonca rarita. Tak kde je problém?\r\n- Vieš, keď ona je pôvodnou majiteľkou toho auta...', 271, 3, 58),
	(13952, 'Chlapík sedí v holičstve a keďže sa mu strašne zapáčila jedna zo zamestnankýň, objedná si aj manikúru. Ona šikovne piluje nechty a on očami šikovne "piluje" po jej nádhernej postave.\r\n- Počuj, keď dokončíš svoju prácu, neskočíme niekam na drink, na večeru?\r\n- Nemôžem. Som vydatá.\r\n- Ale no tak! Stačí keď povieš mužovi, že si išla na návštevu ku priateľke, na nákupy alebo také niečo...\r\n- Povedz mu to sám. Práve ťa holí...', 470, 3.15, 58),
	(13953, 'Muž so ženou sa hádajú kto má väčšie potešenie zo súlože.\r\n"Pravdaže, my chlapi! Prečo by sme ináč celý život behali za sukňami?"\r\n"To ešte nič neznamená" - nedá sa žena. "Skús si predstaviť: keď sa vŕtaš v uchu, čo sa cíti lepšie - prst, alebo to ucho?"', 285, 3.35, 58),
	(13954, '- Vydatá? - pýta sa sudca. \r\nSvedkyňa si povzdychne. \r\n- Slobodná - nadiktoval sudca zapisovateľke. \r\n- Ženatý? - pýta sa sudca druhého svedka. \r\nSvedok si povzdychne. \r\n- Ženatý - diktuje sudca.', 206, 3.06, 58),
	(13955, 'Vojak dostal list od svojej frajerky.\r\nDrahý, nemôžem na teba už dlhšie čakať. Padli sme si do oka s tvojim otcom a minulý týždeň sme sa aj zobrali. Takže, pozdravuje ťa tvoja mama!', 194, 3.18, 58),
	(13956, 'Ležia novomanželia v posteli, keď z muža vyjde, že mal predtým aj inú ženu. A jeho manželka na to, že aj ona mala iného muža a bol to Tiger Woods. A tak ako sa milujú. Po prvom čísle ide muž do kuchyne, že si niečo zoberie z chladničky. Jeho manželka mu však hovorí, že Tiger by ju pomiloval ešte raz a až potom by šiel do chladničky. A tak muž pomiluje manželku ešte raz a už je naozaj hladný, keď mu ona hovorí, že Tiger by ju pomiloval aj tretíkrát. A on nechce byť o nič slabší a pomiluje ju aj tretíkrát. Ale po tomto čísle je už naozaj hladný a ide preč, keď sa ho manželka pýta, či ide do kuchyne. A on jej na to:\r\n- Nie, idem zavolať Tigerovi, aký par má táto jamka.', 730, 3.07, 58),
	(13957, 'Jano si to rozdáva so svojou ženou a v najlepšom jej povie:\r\n- Drahá, ty ju máš ako kombajn.\r\nŽena sa naštve, zlezie z neho, otočí sa chrbtom a robí sa, že spí. Takto ho ignoruje aj ďalší večer a na tretí večer to už Jano nevydrží a vraví jej:\r\n- Veď sa už toľko neondej... no.\r\nŽena však odmieta ďalej. Tak ju Jano začne obchytkávať a ona mu vraví:\r\n- Nechaj ma, ja kvôli takému tenkému slabému klásku nebudem štartovať celý kombajn.', 475, 3.3, 58),
	(13958, 'Ide mladý muž oblečený v novom saku po ulici a uvidí mláku vody, zohne sa a začne z nej piť. Ide okolo mladá žena a hovorí mu:\r\n- Pane, postavte sa. Veď sa tu na ulici úplne strápnite a zahanbíte.\r\nMladý muž sa postaví a odpovedá:\r\n- Imidž je na nič, počúvaj smäd!', 288, 3.09, 58),
	(13959, '- Marienka, pobozkaj ma.\r\n- Nemožem, Janíčko.\r\n- A to už prečo?\r\n- Lebo som vydatá. Správne by sme sa ani milovať nemali!', 129, 3.06, 58),
	(13960, 'Životom sklamaná žena si podá inzerát:\r\n"Potrebujem muža. Takého, ktorý by ma nebil, čo by odo mňa neutiekol a ktorý je dobrý v posteli." Značka: "Ozveš sa?"\r\nOzvali sa. Stovky telefonátov, desiatky listov a zrazu niekto zvoní pri dverách bytu. Žena otvorí a tam taká kreatúra.\r\n- Kto si a čo chceš?\r\n- Som tvoj vysnívaný muž. Nemám ruky a preto ťa nebudem biť. Nemám ani nohy a tak ti neutečiem. No a do tretice, hádaj čím som zazvonil...', 473, 3.19, 58),
	(13961, 'Bavia sa dvaja: \r\n- Ty, počul si, že ženy riadia už aj raketoplán?\r\n- Neblázni, fakt?\r\n- Hej, v NASA zistili že, keď parkuje, tak s ním nemusí cúvať.', 161, 2.82, 58),
	(13962, 'Posledný kontakt s raketoplánom Challenger pred tým, než explodoval bol: \r\n"Tu kapitán a teraz prenechávam riadenie poručíčke."', 136, 2.81, 58),
	(13963, 'Príde Agent 007 do baru, kde sedí krásna, dlhovlasá blondínka a popíja si svoj drink. 007 neodolá, prisadne si a predstaví sa:\r\n- Bond, James Bond.\r\nŽena si odpije trochu z drinku a vraví:\r\n- Off, fuck off!', 216, 3.1, 58),
	(13964, 'Ženy sú muchotrávky. Chcú žiť na vysokej nohe a ešte aj otravujú!', 73, 3.26, 58),
	(13965, '- Prečo si si ma vlastne zobrala?\r\n- Pretože máš druhý najväčší penis, aký som kedy videla.\r\n- A ten prvý bol ktorý?\r\n- Ten má tá malá soška anjelika na námestí.', 179, 3.15, 58),
	(13966, '- Miláčik, chcela by som zomrieť v tvojom náručí.\r\n- Neblázni, Eva, čo by som robil s mŕtvolou?', 104, 2.88, 58),
	(13967, 'Na pracovisku hovorí jeden kolega druhému:\r\n- Všimol som si, že naša nová šéfka sa na teba hnevá. Čo sa stalo?\r\n- V slabej chvíli chcela, aby som hádal, koľko má rokov. \r\n- No a?\r\n- Uhádol som.', 208, 3.01, 58),
	(13968, 'Čo je najväčšia drzosť? \r\nSpýtať sa ženy, koľko palcovú má mechaniku.', 80, 3.46, 58),
	(13969, '- Váš syn mi povedal, že som krava.\r\n- Prepáčte, nechápem. Vždy som ho učil nehodnotiť ľudí podľa zovňajška.', 122, 3.22, 58),
	(13970, 'Finále Stanley cup-u. Chlapík sa prediera k  svojmu sedadlu v  strede hľadiska. Keď si sadne, s údivom zistí, že sedadlo vedľa neho je prázdne. A tak sa cez neho nakloní a pýta sa, či tam niekto bude sedieť. \r\n- Nie - odpovedá sused - to miesto je prázdne. \r\n- To nie je možné - čuduje sa chlapík - kto dopekla môže mať lístok na takýto zápas a nepríde?\r\n- Viete, to miesto je vlastne moje. Každý rok som chodil na finále Stanley cup-u so svojou ženou, ale tento rok som sám, pretože moja žena prednedávnom zomrela.\r\n- Prepáčte, úprimnú sústrasť, to mi je naozaj ľúto. Ale veď ste mohli ísť s niekým iným, s  nejakým príbuzným, alebo známym...\r\n- Nie, nemohol. Všetci sú na pohrebe.', 735, 2.98, 58),
	(13971, '"Čo si to o mne myslíte, pane? Že som nejaká ľahká žena? O mňa treba bojovať!"\r\n"No tak, nech ťa pomiluje Sandokan..."', 128, 3.35, 58),
	(13972, '- Miláčik, od zajtra sa budeme milovať každý deň, lebo ináč ti vypadajú zuby.\r\n- Zuby? A to prečo?\r\n- Lebo ti rozbijem hubu.', 134, 3.54, 58),
	(13973, 'Krásna žena je ako vesmír. Všetci ju túžia spoznať, \r\nale len vyvolení sa do nej dostanú.              ', 112, 3.86, 58),
	(13974, 'Aký je rozdiel medzi rádiom a ženou?\r\nŽiadny.\r\nHore sú to samé vlny a dolu nevieš, čo chytíš!              ', 117, 3, 58),
	(13975, 'Žena píše advokátovi:\r\nVážený JUDr. Ruth,\r\npíšem Vám, aby som sa poradila o mojom probléme. Som už vyše 20 rokov vydatá. Môj manžel je sexuálny maniak. Miluje sa so mnou v tých najneočakávanejších chvíľach. Napr. keď periem, žehlím, alebo varím v kuchyni. Prosím Vás, nemohli by ste mi po... luzftrfskioj... pojuiugfztdrs...              ', 368, 3.88, 58),
	(13976, 'Pýta sa žena muža:\r\n"Čo by si povedal na to, keby som sa vyspala s niekým iným?"\r\n"Na to sa neodpovedá, za to sa len bije."              ', 144, 3.9, 58),
	(13977, 'Prečo sa nevesty vydávajú v bielych šatách?\r\nAby naplno vyjadrili svoju radosť. Z toho logicky vyplýva, prečo je ženích v čiernom.              ', 155, 3.2, 58),
	(13978, 'On a ona v parku. On ju hladká po chrbte a ona sa ho pýta:\r\n"Zlatko, čo robíš?"\r\n"Hľadám prsia."\r\n"Ale tie mám vpredu."\r\n"Tam som už hľadal."              ', 165, 4.17, 58),
	(13979, 'Na plavárni hovorí ona jemu:\r\n"Hej! Z plaviek ti trčí šnúrka, strč si ju dnu!"\r\n"To nie je šnúrka."              ', 122, 2.88, 58),
	(13980, 'Existencia ľúbostného trojuholníka je možná vtedy a len vtedy, ak jeden z uhlov je tupý.              ', 109, 3.9, 58),
	(13981, 'Má vplyv pánska spodná bielizeň na zníženú potenciu?\r\nNie, ale ako výhovorka je to dobré.              ', 112, 3.8, 58),
	(13982, '- Slečna vy ste neprístupná ako pevnosť...\r\n- Záleží od toho, akým kalibrom ma budete dobíjať.              ', 118, 3.2, 58),
	(13983, 'Sú tri fázy v živote ženy, kedy jej muž vôbec nerozumie:\r\nPred svadbou, počas svadby a po svadbe.              ', 118, 3.5, 58),
	(13984, 'Hovorí muž neznámej žene:\r\n-Slečna, tak sa na mňa pozeráte, akoby ste mali voľný byt.              ', 108, 3, 58),
	(13985, 'Po nie veľmi vydarenej manželskej noci zahundre manželka mužovi:\r\n- Aj ten plat máš taký malý.\r\n- Aj tú hubu máš už takú veľkú.              ', 156, 3.5, 58),
	(13986, 'Aký je rozdiel medzi ženami a parkovacímy miestami? Nijaký. Tie najlepšie sú obsadene a voľne sú už iba pre telesne postihnutých.              ', 153, 3.22, 58),
	(13987, 'Na ulici stretne dievča chalana \r\na pozdraví ho: "Čauko!"\r\nOn jej odvetí: "Čaupi!"              ', 101, 3.5, 58),
	(13988, 'Mara je po prvý raz tehotná. Po prehliadke u gynekológa sa na konci ešte spýta:\r\n"Viete, pán doktor... môj manžel by chcel vedieť..."\r\n"Ja viem, ja viem... - preruší ju lekár - túto otázku počujem často. Sex v tehotenstve nie je žiadny problém až do ôsmeho mesiaca."\r\n"Ale, pán doktor, manžel chcel vedieť, dokedy môžem kosiť na záhrade trávu."              ', 386, 3, 58),
	(13989, 'Kto je skromnejší? Muž alebo žena?\r\nŽena, tá sa uspokojí s kúskom mäsa, ktoré muž nechal stáť.              ', 121, 3.89, 58),
	(13990, 'Mladá pani sa kúpe vo vani keď v tom zvoní zvonec. Narýchlo nemôže nájsť žiadne šaty tak si len prehodí ponožku. Otvorí dvere a tam stojí zízajúci chlap. Ona sa na neho díva a rozčúlene sa pýta:\r\n"Vy ste ešte nikdy nevideli holú ženu?"\r\nOn jej odpovedá:\r\n"Nahú áno, ale chlapa tak hlboko ešte nikdy."              ', 342, 4, 58),
	(13991, '"Ty máš futbal radšej ako mňa!"\r\n"Áno", súhlasí muž, "ale teba mám zase radšej ako basketbal".              ', 118, 3.67, 58),
	(13992, 'Hovorí Fero frajerke:\r\n"Marka, daj si tento kúsok torty."\r\n"Ďakujem, Ferko, nechcem!", odmietne Marka.\r\n"Marka! Prosím ťa, daj si kúsok torty..."\r\n"Ferko, ja sladké nemôžem, pribrala by som..."\r\n"Prosím ťa..."\r\n"Naozaj nechcem tortu!"\r\n"Žer tú tortu, ty krava! Je v nej prsteň! Chcem ťa požiadať o ruku!!!"              ', 337, 3.82, 58),
	(13993, 'Podľa názorov amerických psychológov sú dve hlavné príčiny, prečo muž trávi večery v bare:\r\n1. Nemá ženu.\r\n2. Má ženu.              ', 148, 3.93, 58),
	(13994, 'Viete, čo majú muži a ženy spoločné?\r\nNedôveru k mužom.              ', 77, 3, 58),
	(13995, '"Ten Milan mení frajerky ako ponožky!"\r\n"To je pravda, každý mesiac má inú."              ', 96, 3.83, 58),
	(13996, 'Hovorí muž žene:\r\n"Pani, v autobuse sa musíte držať rúry!"\r\n"Veď sa aj držím."\r\n"No dobre, ale ja chcem za chvíľu vystupovať!"              ', 153, 2.67, 58),
	(13997, 'Mladá hovorí chalanovi:\r\n"Na to, že máš 30 rokov ho máš nejakého malého."\r\n"Na to, že máš 12 rokov si nejaká papuľnatá!"              ', 149, 4.2, 58),
	(13998, 'Rozprávajú sa dvaja chlapi:\r\n"Už si spal s mojou ženou?"\r\n"Nie."\r\n"Ale mal by si. Je lepšia ako tvoja."              ', 122, 3.29, 58),
	(13999, 'Viete, prečo muži nikdy neukazujú svoje skutočné pocity?\r\nLebo ich nemajú.\n', 81, 3.5, 58),
	(14000, 'Viete, aký je rozdiel medzi mužom a dieťaťom?\r\nTakmer žiadny, ale dieťa aspoň môžete nechať samé s opatrovateľkou!              ', 140, 3.88, 58),
	(14001, '"Drahá, dnes večer ti prinesiem modré z neba!"\r\n"Ja nechcem žiadne modré z neba. Pekne budeš doma sedieť!"              ', 127, 3, 58),
	(14002, 'Nervózna žena kričí na svojho muža:\r\n"Predpokladám, že máš naozaj dobrý dôvod, keď sa odvážiš prísť domov ráno o šiestej a ešte k tomu totálne ožratý!"\r\n"Hik, pravdaže mám, hik, raňajky..."              ', 229, 3.71, 58),
	(14003, 'Rozprávajú sa dve priateľky:\r\n"Počula si? Zuza sa vydáva."\r\n"Hej? A za koho?"\r\n"Za svojho gynekológa..."\r\n"???"\r\n"Je to prvý muž, ktorý do nej skutočne vidí..."\n', 172, 3, 58),
	(14004, 'Viete čo je to devalvácia kovov?\r\nTo je, keď vymeníš zlaté srdce manžela za oceľový penis kolegu.              ', 120, 3.71, 58),
	(14005, 'Mudruje Adam v raji:\r\n"Je to nespravodlivé, že nám Boh dal len 15 rokov sexu a pritom opiciam ho dal na 25 a papagájom dokonca na 60 rokov. Tak to teda nie! Idem za nimi, aby mi dali polovicu zo svojho. A tak aj urobil. Odvtedy chlap 15 rokov môže, 12 rokov robí opičky a zvyšok života o tom len rozpráva.              ', 330, 4.13, 58),
	(14006, 'Mladá prostitútka si privedie do izby zákazníka. Pri vyzliekaní sa jej muž medzi rečou spýta:\r\n"A koľko máš vlastne rokov?"\r\n"Trinásť."\r\n"Trinásť? Tak to ja radšej idem inde." vykríkne rozhorčene muž a odíde. Dievča sa zamračí a zafrfle:\r\n"Tak si len choď, hlupák jeden poverčivý!"              ', 322, 3.86, 58),
	(14007, 'Hovorí žena mužovi:\r\n"Nebyť teba, tak by sme boli ideálny pár!"              ', 83, 3.6, 58),
	(14008, 'Čo robí žena po sexe?\r\nZavadzia!              ', 49, 3.71, 58),
	(14009, '"Pekná mladá slečna kráča po ulici. Mladý muž sa jej pýta:\r\n"Slečna, kam kráčajú tie pekné nohy?"\r\n"Ak sa medzi ne nič nepripletie, tak do kina."              ', 173, 3, 58),
	(14010, '"Jano, preboha prečo hádžeš ten hasiaci prístroj do hrobu svojej ženy!"\r\n"On sa tej bosorke v pekle ešte zíde!"              ', 133, 3.67, 58),
	(14011, 'Žvot ženy sa delí na tri obdobia:\r\n1. Ide na  nervy svojmu otcovi.\r\n2. Ide na nervy svojmu mužovi.\r\n3. Ide na nervy svojmu  zaťovi.              ', 150, 3.73, 58),
	(14012, 'Otec početnej rodiny študuje knihu o antikoncepcii.\r\n"Už viem, v čom to je," vykríkne na svoju ženu,\r\n"tie tabletky musíš brať ty a nie ja!"              ', 163, 3.5, 58),
	(14013, 'Ženy s malým poprsím si myslia, že aj v tomto prípade platí pravidlo zachovania hmoty - že keď nemá v kozách, má v hlave, alebo keď nemá v hlave, má v kozách...\r\nAké z toho plynie poučenie?\r\nŽeny s malým poprsím, čo si myslia, že sú inteligentné sú dôkazom toho, že hmota sa môže stratiť úplne.              ', 339, 3, 58),
	(14014, 'Príde chlap z fitness centra domov\r\na hovorí žene:\r\n"Všetky svaly ma bolia, ale to je dobre. Keď bolia, znamená to, že rastú."\r\nŽena ho kopne medzi nohy a vraví:\r\n"Tak nech rastie!"              ', 205, 4.05, 58),
	(14015, 'Muž prichádza domov s pochmúrnou náladou. Kabát odhadzuje ledabolo, nepozdraví svoju manželku, pripravenú večeru je s nechuťou. Vidiac to všetko jeho žena, snaží sa mu zlepšiť náladu.\r\n"Drahý, som tehotná."\r\n"Bože, ty tiež?"              ', 259, 3.2, 58),
	(14016, '"Vždy hľadám u žien vnútornú krásu...\r\nAkonáhle som vo vnútri - krása!"              ', 95, 3, 58),
	(14017, 'Je dokazané, že priemerná vagína má dĺžku 20 cm a priemerná dĺžka penisu je 15 cm. Z toho vyplýva, že na Slovensku je 125 km zbytočnej kundy.              ', 168, 4.2, 58),
	(14018, '"Pištáá," kričí sused na suseda v záhrade, "tvoja žena bola vo Francúzsku?"\r\n"Ale čoby! To som ju ja naučil."              ', 133, 3.72, 58),
	(14019, 'Slečna, poďte si so mnou zatancovať slaďáčik!\r\nĽutujem, mám cukrovku.              ', 91, 3.14, 58),
	(14020, 'Manžel:\r\n"Čo keby sme si dnes vyskúšali nejakú novú polohu? Napríklad sa vymeníme."\r\nManželka:\r\n"Dobrý nápad. Ty sa postavíš k drezu a budeš umývať riad a ja si sadnem na pohovku a budem prdieť!"\n', 213, 4.15, 58),
	(14021, 'Manželia ležia večer spolu v posteli. Manžel:"Drahá, predstav si, postavil sa mi!"\r\n"Drahý, rýchlo poď ku mne bližšie!"\r\n"Pssst... Aby ťa nespoznal po hlase!"\n', 170, 3.87, 58),
	(14022, 'Mladý muž sa pýta:\r\n"Slečna mám u vás šancu?"\r\n"Áno ste druhý v poradí."\r\n"A kto je prvý?"\r\n"Hocikto iný."  odpovedá s úsmevom mladá dáma.\n', 155, 4, 58),
	(14023, 'Viete, prečo zostáva čoraz viac a viac žien slobodných?\r\nLebo pochopili, že nemusia kvôli jednej klobáse chovať celú sviňu!\r\nA viete, prečo zostáva slobodných stále viac a viac mužov?\r\nLebo pochopili, že najdrahšia je láska, ktorá je zadarmo.              ', 276, 3.4, 58),
	(14024, 'ADAM:\r\n"Miluješ ma?"\r\nEVA:\r\n"A mám na výber?"\n', 49, 4, 58),
	(14025, '"Slečna, vy máte krásne prsia, sú pravé?"\r\n"Nie, jedno z nich je ľavé."              ', 92, 3.88, 58),
	(14026, 'Dvaja priatelia sa rozhodnú podať si tikety na športku, a tak jeden vraví druhému:\r\n"Karol, keby ti vyšli aspoň štyri čísla, tak by si bol šampión!"\r\nTu sa z kuchyne ozve manželka a hovorí:\r\n"Ja by som bola spokojná, keby mu občas vyšlo aspoň jedno..."\n', 271, 4, 58),
	(14027, 'Viete, aký je rozdiel medzi ženou a diviakom?\r\nŽena nemá celú tvár od blata, kým nájde žaluď.              ', 117, 3.33, 58),
	(14028, 'Viete, aký je rozdiel medzi peknou a škaredou ženou?\r\nNo predsa ako medzi bradavkou a bradavicou.              ', 114, 3.71, 58),
	(14029, 'Žena kričí:\r\n"Pomóc, zhltla som ihlu!"\r\n"Čo kričíš, tu máš druhú!" zlostí sa muž.              ', 108, 3.93, 58),
	(14030, 'Na prvej hodine v tanečnej. Jeden mládenec tancuje s krásnou slečnou a aby sa odreagoval, tak jej stále stláča zapínanie na podprsenke. A ona na to:\r\n"Prosím vás, čo to robíte?"\r\n"Ja na vás zvoním."\r\n"Aha, mne sa zdalo, že dole niekto stojí," hovorí slečna.              ', 289, 4, 58),
	(14031, 'Leží večer manželský pár v posteli a žena hovorí :\r\n"Rada by som mala väčšie prsia."\r\n"Tak si ich skús šúchať toaletným papierom."\r\n"Toaletným papierom? A čo by to ako malo robiť?"\r\n"No, neviem, ale pozri sa čo ti to urobilo so zadkom."              ', 270, 4, 58),
	(14032, 'Príde tlstá ženská ku gynekológovi a hovorí mu:\r\n"Pán doktor, vážim 150 kg, manžel 180 kg. Nemohli by ste mi prešiť vagínu niekam inam? My sa kvôli tým bruchám k sebe ani nedostaneme!"\r\nDoktor sa otočí na sestru a súcitne si poklepe na čelo.\r\nŽena vykríkne: "Tam nie! To by mi manžel rozbil guľami okuliare!"              ', 346, 3.67, 58),
	(14033, 'Viete, čo by sa stalo, keby sa Zem točila 30-krát rýchlejšie?\r\nMuži by mali každý deň výplatu a ženy by vykrvacali.              ', 140, 3.6, 58),
	(14034, 'Dcéra hovorí svojej mame:\r\n"Nezabudni, že keď budeš nabudúce\r\nv spoločnosti hovoriť o našom veku, musí byť medzi nami minimálne 9 mesiacov rozdiel!"              ', 174, 3.5, 58),
	(14035, 'Pýtajú sa pani Kukučkovej, či sa chce nechať po smrti spopolniť alebo sa nechá pochovať.\r\n- Čo ja viem, ale asi dám na svojho muža a poslúchnem ho.\r\n- A ten čo hovorí?\r\n- Ten mi stále hovorí, že sa mám dať vypchať.\n', 235, 4, 58),
	(14036, 'Muž sa jedného večera vráti domov skôr ako obyčajne a očividne rozladený. Ľahne si k manželke a začne ju hladkať:\r\n"Daj stým pokoj! Veď vieš, že teraz nemôžem!"\r\n"Čo ste sa dnes všetky na mňa dohovorili, či čo?"\n', 235, 3.57, 58),
	(14037, 'Žena vyčíta mužovi:\r\n"Mohol by si niečo pre mňa urobiť, aby som nemusela stále chodiť domov cez ten les? Večer tam býva tma, čo keď ma tam niekto znásilní?"\r\nMuž jej s kľudom odpovedá:\r\n"Taká tma ešte nebola."\n', 230, 3.83, 58),
	(14038, 'Pod manželskou posteľou leží 6 ročný Janko a počúva rodičov. Mama: "Otecko ty máš, ale pekný paroček!" \r\nOtec: "Mami ty máš, ale peknú žemličku!" \r\nJanko spod postele kričí: "Nepotrebujete horčicu?"              ', 233, 3.88, 58),
	(14039, 'Prečo majú ženy krámy? \r\nLebo mužom pijú krv!              ', 65, 3.42, 58),
	(14040, '"Hlupák jeden", rozčuľuje sa modelka, po návrate od sochára.\r\n"Nestačilo mu, že ťa modeloval, však?" Zaujíma sa jej kolegyňa.\r\n"No veru. Chcel ešte aby som mu aj varila."              ', 196, 2.67, 58),
	(14041, '- Jáj, ten môj Jožko je ale super chlap!\r\n- Ako to vieš?\r\n- Včera som mu povedala, že ho už nechcem vidieť a on zhasol svetlo.              ', 148, 2.75, 58),
	(14042, 'Na väčšej párty príde chlapík k jednej žene a niečo jej šepká do ucha. Ona vykríkne:\r\n- Vy perverzný dobytok, snáď si nemyslíte, že by som vás nechala robiť mi také veci?\r\nVzápätí sa jej zúžia oči a ona tichým hlasom dodá:\r\n- Ibaže by ste bol ten sviniar, čo mi ukradol môj diár...              ', 326, 4.21, 58),
	(14043, '- Zlatica, ako môžeš takto podvádzať svojho manžela?\r\n- A poznáš nejaký iný spôsob?              ', 108, 3, 58),
	(14044, '- Otec, neženatý chlap sa volá slobodný?\r\n- Áno.\r\n- A ako sa volá ženatý?\r\n- Neotravuj, si ešte malý, aby si poznal také slová.              ', 153, 3.83, 58),
	(14045, 'Viete ako volá manželka vegetariana k obedu:\r\n- Zlatko poď obedovať, lebo ti to zvädne.              ', 106, 3.33, 58),
	(14046, 'Príde slečna ku gynekológovi a pýta sa:\r\n- Pán doktor, môže žena otehotnieť od Hofmannských kvapiek?\r\nDoktor odpovedá: \r\n- Ale nie milá slečna.\r\n- To mi spadol kameň zo srdca, viete, bola som včera večer s pánom Hofmannom a povedal mi, že mu tam trocha odkvaplo.              ', 294, 3, 58),
	(14047, 'Čo sa stane so ženou, ktorá namiesto antikoncepčných tabletiek berie tabletky na ukľudnenie?\r\nMá osem detí a vôbec ju to nestve!              ', 151, 3, 58),
	(14048, 'Na obed sa zoznámili, večer sa zosobášili a ráno ju uškrtil! Aké ponaučenie z toho plynie? Ráno múdrejšie večera.              ', 139, 4, 58),
	(14049, 'Čo je pre muža úspech?\r\nKeď zarobí viac ako jeho žena stihne minúť.\r\nViete, čo je úspech pre ženu?\r\nKeď takého muža nájde.              ', 151, 3.75, 58),
	(14050, '- Slečna, prečo sa maľujete ?\r\n- No aby som bola pekná !\r\n- Hm, a prečo nie ste ?              ', 100, 3.89, 58),
	(14051, '- Zdravím vás, suseda! Od čoho ste tak zachrípli?\r\n- Ále! Starý prišiel v noci ožratý z krčmy.              ', 118, 3.8, 58),
	(14052, '- Môj manžel ochrnul.\r\n- Celý?\r\n- Nie, iba 13 centimetrov.              ', 75, 3.67, 58),
	(14053, 'V raji nastal obraz: Adam, Eva a jablko v jej ruke. Prichádza Boh a hovorí:\r\n- Tak toto mi zaplatia ženy krvou! \r\nEva sa bráni: \r\n- Naraz to predsa nejde, to by sa muži museli naučiť rodiť. \r\nBoh si stojí na svojom: \r\n- Tak sa dohodneme na mesačných splátkach.\r\nA odvtedy majú ženy menštruáciu.              ', 324, 3.67, 58),
	(14054, 'Vlak vojde do tunela a z tmy sa ozve dievčenský hlas:\r\n- Dajte tú ruku preč, dobre?! Nie, vy nie! Vy!              ', 119, 3.25, 58),
	(14055, 'Bola to taká čistotná ženská.\r\nMala vymytý aj mozog.              ', 72, 3.22, 58),
	(14056, 'Keď som ti vravela, aby si ma oslovoval tak, aby som ti nepripomínala žiadnu z tvojich predošlých žien, neznamená to ešte, že mi môžeš vravieť Hugo!              ', 175, 3.5, 58),
	(14057, '- Včera sme sa s manželkou strašne pohádali, ale nakoniec priliezla po kolenách.\r\n- A čo povedala?\r\n- Vylez spod toho gauča, ty zbabelec!              ', 158, 3.83, 58),
	(14058, 'Mladý muž stojí pri otvorených dverách a vysvetľuje:\r\n"Idem vás požiadať o ruku vašej dcéry. Je to však len formalita."\r\n"No dovoľte!" hnevá sa budúci svokor,  "Kto vám povedal, že je to len formalita?"\r\n"Gynekológ."              ', 248, 3.67, 58),
	(14059, '- Pán Novotný, vaša slečna dcéra pred malou chvíľkou súhlasila, že sa stane mojou ženu."\r\n- Sám ste si na vine. Načo sem každý večer chodíte!\n', 158, 4.06, 58),
	(14060, 'Aký je rozdiel medzi pannou a dôchodkyňou?\r\nŽiadny. Obidve čakajú na prvého.              ', 97, 3.67, 58),
	(14061, 'Manžel svojej žene: \r\n- Miláčik, môžem v tebe rozpálit oheň vášne a túžby?\r\nManželka pobavene: \r\n- Tou tvojou zápalôčkou, hej?              ', 156, 3.33, 58),
	(14062, 'Aká je to žena na zahriatie?\r\nTaká, že keď na ňu pozrieš, si hneď radšej teplý.              ', 103, 4.25, 58),
	(14063, 'Dve ženy v kine. Jedna sa nakloní k druhej a šepká:\r\n- Počuj, ten chlapík vedľa mňa tu onanuje!\r\n- Kašli na neho, ignoruj ho.\r\n- To nejde, onanuje mojou rukou.              ', 182, 3.86, 58),
	(14064, 'Aký je rozdiel medzi pesimistom a optimistom?\r\nPesimista si myslí, že všetky baby sú štetky a optimista v to dúfa.              ', 135, 4.05, 58),
	(14065, 'Ako sa pozná ideálny manžel?\r\nNájde milenca u ženy v posteli a povie:\r\n- Kľudne pokračujte, ja idem zatiaľ uvariť kávu.\r\nA ako sa pozná ideálny milenec?\r\nKeď aj potom dokáže pokračovať!              ', 216, 3.5, 58),
	(14066, 'Ide Janko ku Marienke zaklope jemne na dvere a hovorí:\r\n- Marienka môžem vojsť?\r\n- Nie Janko nie!\r\n- Prečo?\r\n- Lebo mam iba nočnú košeľu a v telenovele som videla, že muž nesmie ísť k žene ak má iba košeľu.\r\nJanko smutný odchádza a kričí:\r\n- Dobre Marienka prídem neskôr.\r\nMarienka v tom zavolá:\r\n- Už môžeš vojsť. \r\n- ako to?\r\n- Už som si ju dala dole.              ', 397, 3.93, 58),
	(14067, 'Obchodný cestujúci odletel na služobnú cestu do Miami. Keďže sa mu tam veľmi páčilo, tak hneď, akonáhle vybavil pracovné povinnosti, tak si vzal týždeň dovolenky a rozhodol sa tam zostať. \r\nA keďže tam nechcel byť sám, tak poslal fax svojmu priateľovi zo školy:\r\n- Vezmi so sebou moju manželku a svoju milenku a prileť za mnou najbližším lietadlom, nech si užijeme týždeň zábavy.\r\nJeho priateľ okamžite odpísal:\r\n- Ja a tvoja žena priletíme dnes o 11:30. Ako dlho už o nás dvoch vieš?\n', 525, 3, 58),
	(14068, '- Môj manžel má maturitu a stále si pletie mi, my a mne...\r\n- No, to môj manžel má dokonca vysokú... a pletie si mňa a servírku z Brezna...              ', 163, 3, 58),
	(14069, 'Stretnú sa dvaja kamaráti a jeden hovorí: \r\n- Chcel by som kúpiť priateľke kvetinu, ale neviem akú.\r\n- Kúp jej takú, aké máš s ňou úmysly.\r\n- Tak to aby som jej kúpil kaktus.              ', 203, 3.29, 58),
	(14070, 'Bývajú dvaja kamoši na intráku. Jedného dňa vraví jeden druhému: \r\n"Ty, počuj, nemohol by si dnes vypadnúť a prísť až ráno? Dnes totiž za mnou má prísť moja baba." \r\nNa to ten druhý: "Samozrejme, no problém!" \r\nRáno sa ten druhý vracia na intrák, otvorí dvere do izby a vidí peknú spúšť: Celá izba je zaparená, okná zahmlené, prestieradlo prepotené a na posteli leží zničený kamarát. \r\nA tak sa pýta: "Tak čo, dobre..?" \r\nA ten prvý na to: "Desaťkrát!" \r\n"A ona?" \r\n"Neprišla..."              ', 539, 3, 58),
	(14071, 'Príde dcéruška k mame do kúpeľne a mama je nahá. Dcéruška chvíľu kuká, premýšľa a zrazu vraví: \r\n"Maminka, kedy budem mať toto chlpaté medzi nohami?" \r\nMaminka jej odpovedá: "Vieš, to až budeš staršia." \r\nDcéruška ide do spálne a tam je nahý otec a ona sa ho pýta: "Ocinko, kedy budem mať toto medzi nohami?" \r\nTatko na to: "Až maminka odíde!"              ', 387, 3, 58),
	(14072, 'Autobus prudko zabrzdí a fešná slečna pristane dedovi na kolenách:\r\n- Prepáčte, myslela som, že už stojí.\r\n- Žiaľ, už nie.              ', 149, 4, 58),
	(14073, '- Nie, nie, do postele ma dostaneš až po svadbe.\r\n- Dobre, zavolaj keď sa vydáš.              ', 99, 4.11, 58),
	(14074, 'Kedy má byť poriadne dievča v posteli?\r\n- O ôsmej, aby o desiatej mohla byť už doma.              ', 104, 3.5, 58),
	(14075, 'Vlak vojde do tunela a odrazu sa ozve ženský výkrik:\r\n- Tu ktosi súloží... Bože... dokonca somnou!              ', 119, 2.67, 58),
	(14076, '- Miláčik, prečo sa stále obzeráš po iných ženách? Ja ti nestačím?\r\n- Drahá, keby som mal len teba, cítil by som sa ako Adam v raji.\r\n- Ďakujem, si milý...\r\n- On tiež nemal na výber...              ', 215, 3.25, 58),
	(14077, 'Mladý párik sa chce milovať a tak si ide kúpiť do obchodu prezervatívy.\r\nDobrý den máte prezervatívy?\r\nMáme čierny, biely a s mikimauzom odpovie predavačka.\r\nA je v tom  nejaký rozdiel?\r\nNie nie je.\r\nTak si prosíme čierny.\r\nMladý párik prežije vzrušujúcu noc, ale praskne im kondóm. O 9 mesiacov sa im narodí čierny chlapček. Ked vyrastie pýta sa ocka: Ocí a prečo ja som čierny a ty a mamka ste biely? Otec mu odpovie: Bud ticho, bud rád, že nie si mikimauzom!              ', 505, 2.73, 58),
	(14078, '"Konečne som prišla na to, ako z muža vytiahnuť peniaze," chváli sa žena priateľke. \r\n"Včera večer sme sa hádali a ja som mu povedala, že sa vraciam k matke. Dal mi na cestu."              ', 200, 3.78, 58),
	(14079, 'Mladá žena má vážne podozrenie, že ju muž klame. Rozhodne se dohnať ho k žiarlivosti:\r\n"Čo by si povedal, keby som ti teraz oznámila, že som spala s tvojim najlepším přiateľom?"\r\nOn sa len zhovievavo usmeje: \r\n"Myslel by som si, že si lesbička."              ', 277, 3.75, 58),
	(14080, 'Pri pohári whisky sa pýta lord lorda: \r\n"Vaše lordstvo, hovoríte pri súloži so svojou ženou?"\r\n"No, pokiaľ je po ruke telefón."              ', 150, 4.24, 58),
	(14081, 'Mladá žena príde do práce s monoklom. \r\n"Čo sa ti stalo?" pýtajú sa kolegyne.\r\n"Muž ma zmlátil."\r\n"Mysleli sme, že odcestoval."\r\n"Veď práve. Ja som si to tiež myslela."              ', 195, 3.5, 58),
	(14082, '"Čo nepovieš, tvoj manžel ťa pristihol s milencom v posteli? A ako to vzal?"\r\n"Videokamerou."              ', 111, 4, 58),
	(14083, 'Pofajčili Rómeo a Júlia trávu.\r\nI riekol Rómeo:\r\n"Júlia, milujem ťa."\r\nI riekla Júlia:\r\n"Aj ja k tebe cítim takú haluz."              ', 144, 3.75, 58),
	(14084, 'Povie kvetinka kvetinke:\r\n"Ľúbim ťa!"\r\nDruhá odpovie:\r\n"Aj ja teba, zavoláme včielku?"              ', 106, 2.73, 58),
	(14085, 'Zrúti sa lietadlo so štyrmi mníškami. Prídu k nebeskej bráne, kde na ne čaká Svätý Peter. Skôr než ich pustí do neba, spýta sa prvej mníšky, či sa niekedy dotkla pánskeho údu. Mníška odpovie, že áno, ale iba prstom. Svätý Peter jej ukáže na nádobu so svätenou vodou, aby si v nej umyla prst, a potom že môže vstúpiť do neba. Pýta sa druhej mníšky, či sa niekedy dotkla pánskeho údu. Mníška odpovie, že áno, ale iba dlaňou. Svätý Peter nariadi, aby si umyla dlaň svätenou vodou a pustí ju do neba. V tom vystúpi štvrtá mníška predčasne z rady \r\na vraví: "Tak, ak si myslíte, že si v tom vypláchnem ústa, keď si v tom ona umyje zadok, tak to ste na veľkom omyle."              ', 738, 4.18, 58),
	(14086, 'Farár učí mníšku plávať. Mníška: \r\n"Otec, naozaj sa utopím, ak vyberiete váš prst von?"\r\nPred nebeskou bránou              ', 136, 2.64, 58),
	(14087, 'Príde žena na spoveď k novému farárovi a vraví: \r\n"Otče, zhrešila som"\r\n"Ako, dcéra moja?"\r\n"Súložila som s mužom."\r\n"Pomodli sa päťkrát Otčenáš."\r\n"Ale s cudzím mužom."\r\n"Pomodli sa desaťkrát Otčenáš."\r\n"Ale ja som mu robila orálny sex."\r\nFarár sa zamyslí, ide za miništrantom a pýta sa ho, čo za to dával predošlý farár.\r\nMiništrant : "To je rôzne, mne dával niekedy Bravo alebo Fidorku.."              ', 443, 3.83, 58),
	(14088, 'Žena ide z roboty, ujde jej autobus, ide stopovať, zastaví jej chlapík na dodávke, že ju zvezie. Po chvíli to strhne do poľa s ďatelinou otvorí dvere a zreve: „Vystupuj!" \r\nOna: "Nie, nie, mám doma deti a manžela!"\r\nOn na to: "Nekecaj a trhaj, ja mám doma 70 králikov".              ', 299, 4, 58),
	(14089, 'Dve ženy spolu obývajú 20 rokov jednu väzenskú celu. Na slobodu ich pustia \r\nv ten istý deň. Pred bránami väznice vraví jedna druhej: \r\n"Stav sa dnes večer, aby som ti to mohla dopovedať."              ', 214, 3.33, 58),
	(14090, '"Obžalovaný, ako ste mohli svoju ženu, matku dvoch detí, tak bezohľadne zadusiť poduškou?" \r\n"Ako bezohľadne? Nechcel som zobudiť deti."              ', 159, 3.88, 58),
	(14091, 'Do obchodu príde korpulentná pani a vraví predavačovi: \r\n"Rada by som videla nejaké plavky, čo by mi pristali."\r\n"Aj ja", odvetí predavač.              ', 160, 3.89, 58),
	(14092, 'Čo znamená slovo muž?\r\nMizerný Údržbár Ženy.              ', 66, 3, 58),
	(14093, 'Kedy utrpí chlap otras mozgu?\r\nKeď ho kopnú do rozkroku.              ', 73, 1.63, 58),
	(14094, 'Aký je rozdiel medzi pánskym prirodzením \r\na komárom?\r\nKomára môžeš honiť celú noc.              ', 107, 3.88, 58),
	(14095, 'Ako sa volá tá prebytočná koža okolo penisu?\r\nChlap!              ', 71, 4.11, 58),
	(14096, 'Idú si tak dvaja muži do neba a jeden sa pýta druhého:\r\n"Prečo si zomrel?"\r\n"Vieš, prišiel som o deň skôr zo služobnej cesty a chcel  som nachytať moju nevernú manželku. Pozriem do spálne ...  nič. Pozriem do  kuchyne...nič. Do komory ... nič. Do kúpeľne ... nič. Tak som z tej veľkej radosti  dostal porážku."\r\n"Vidíš ty idiot, keby si sa pozrel do chladničky, mohli sme  obaja žiť!"              ', 426, 4.2, 58),
	(14097, '"Počúvaj ma, mne sa zdá, že máš asi málo vápnika. Pýtaš sa, prečo? Pretože, už dva mesiace ti spím s manželkou a tebe žiadne parohy  nie a nie narásť!              ', 182, 3.67, 58),
	(14098, '"Drahý, čo máš na mne najradšej? Moje nádherné telo alebo moju krásnu tvár?" \r\n"Tvoj zmysel pre humor."              ', 126, 3.22, 58),
	(14099, 'U gynekológa:\r\n"Pán doktor mám stále studené stehná, môžete s tým niečo urobiť?"\r\n"A vadí Vám to?"\r\n"Mne ani nie, ale manžel má stále zápal stredného ucha."\n', 175, 3.67, 58),
	(14100, 'Silvestrovský večer, rodinná pohoda. Manžel sedí \r\nv trenírkach pri televízii, ale blíži sa doba, keď čakajú návštevu.\r\n"Už by si sa mal obliecť."\r\n"Naschvál sa neoblečiem, nech vidia ako ma málo kŕmiš!"\r\n"Tak si zobleč aj trenky, nech vidia, \r\nže nemám za čo!"              ', 300, 3.5, 58),
	(14101, 'Onanoval vo vani. Keď bol hotový a liezol von, tak sa šmykol na svojom produkte, natiahol sa jak bol široký a dlhý a zreval:\r\n"To je hrôza i vlastné deti by človeka zabili."              ', 196, 3.7, 58),
	(14102, 'Mladík sa pripotáca k slečne sediacej pri stole. \r\n"Hej, nešla by si tancovať?" \r\nDievčina rozpačite odpovie: \r\n"...Nno...Áno.." \r\n"Tak bež, nemám si totiž kam sadnúť."              ', 195, 3.86, 58),
	(14103, 'Aký je postup lásky?\r\nNajprv ti žena lezie do postele, potom do peňaženky a nakoniec na nervy.              ', 113, 3.64, 58),
	(14104, 'Aký je rozdiel medzi netopierom a mužským prirodzením?\r\nŽiadny. Cez deň to visí a v noci to lieta bohvie kde.              ', 130, 1.58, 58),
	(14105, 'Pán Smutný vojde do obchodu so zmiešaným tovarom a hovorí:\r\n"Je sezóna plesov a ja chcem ísť na karneval preoblečený za Adama."\r\nPredavačka mu prinesie figový list.\r\n"Tento je malý!"\r\nPredavačka prinesie ďalší, väčší list.\r\n"Aj ten je malý!"\r\nPredavačka robí maximum pre spokojnosť zákazníka a prinesie ten najväčší list zo skladu.\r\n"Stále malý!"\r\nTo už ženu za pultom nahnevá a hovorí:\r\n"Počujte, šampión! Najlepšie bude, ak si ho prehodíte cez plece a pôjdete prezlečený za benzínové čerpadlo!"              ', 558, 4.08, 58),
	(14106, 'Dvaja teplí chcú spolu žiť a predtým sa jeden  z nich dá operačne zmeniť na ženu. Po operácii sa ho ten druhy pýta, aké to bolo. \r\n"Vieš, keď mi robili prsia trochu to šteklilo, ale keď mi vyberali mozog, to ti bola strašná bolesť!"              ', 265, 3.75, 58),
	(14107, 'Boh stvorí muža a vraví:\r\n- Hmm...pekný.\r\nStvorí ženu a vraví:\r\n- Hmm...veď ona sa namaľuje.              ', 115, 3.83, 58),
	(14108, 'Muž posiela domov manželke telegram z liečenia:\r\n"Pošli mi 5.000 korún. Predĺžia mi." Manželka pošle peniaze a v správe pre prijímateľa napíše odkaz: "Posielam ti 10.000 korún, nech ti aj zhrubnú."              ', 227, 3.86, 58),
	(14109, 'Stretnú sa dvaja: „Ako sa máš?“\r\n„Človeče, nejako sa mi obrátil tok krvi. Kedysi stačilo, aby ma ženská pohladila po hlave a hneď sa mi postavil. A dnes, keď mi ženská hrabne do nohavíc, tak mi vlasy dupkom stávajú.“              ', 254, 3.6, 58),
	(14110, 'Otec sa rozpráva v drogérii so svojim \n8 ročným synom. Syn zbadal kondómy \na pýtal sa na čo to je.\n"Na bezpečný sex."\n"A prečo sú tam 3 kusy v krabičke?" pýta sa syn.\n"To sú pre stredoškoláka - jeden na piatok, jeden na sobotu a jeden na  nedeľu."\n"Super! A na čo sú krabičky so 6 kusmi?"\n"To je pre vysokoškoláka - 2 na piatok, 2 na sobotu a 2 na nedeľu."\n"Vav! A kto používa toto?" a ukázal na krabičku s 12 kusmi.\n"To je pre ženatých mužov - jeden na január, jeden na február..."              ', 528, 3.8, 58),
	(14111, 'Prebieha milostný akt. Lord súloží, komorník drží sviečku. Lord sa pýta: \n"Lady, ste ukojená?" \n"No, my Sir." \nPo chvíli: \n"Lady, ste ukojená?" \n"No, my Sir." \nLord hovorí komorníkovi: \n"James, teraz ty budeš súložiť a ja budem držať sviečku." \nPo chvíli: \n"Lady, ste ukojená?" \n"Oh yes, my Sir." \n"Vidíš, James, takto sa drží sviečka."              ', 378, 3.67, 58),
	(14112, 'Stretne raz slon nahého muža a začne sa strašne smiať. Smeje sa, až mu tečú slzy. Keď sa konečne ukľudní, spýta sa muža:\n"Prosím ťa, ako sa týmto môžeš vôbec nažrať?"              ', 203, 3.87, 58),
	(14113, 'Viete, prečo je pre muža ťažké nadviazať očný kontakt?\nPretože prsia nemajú oči.              ', 105, 3.43, 58),
	(14114, 'Ako môžete zmeniť mužský mozog na maličký hrášok? \nMusíte ho poriadne nafúknuť a natrieť na zeleno.              ', 126, 3.5, 58),
	(14115, 'Pýta sa Záhoráčka svojho muža:\n"Francku, čo bys delal, keby si mňa našol v posteli\nsúložiť s cudzím chuapem?"\n"Dobre by sem ho ujebau s tú bílú palicú!"\n"S jakú bílú palicú?"\n"Šak teba by pretiahou len slepý!!!!"              ', 248, 3.64, 58),
	(14116, 'Muž si uväzuje kravatu pred zrkadlom a hovorí svojmu pipíkovi: \n"Keď si kúpim nové ponožky to sa pozeráš, ale keď mám novú kravatu to sa ani len nehneš..."              ', 183, 3.5, 58),
	(14117, 'Aký je rozdiel medzi Fidelom Castrom a Pamelou Anderson?\nFidel si pre strnisko nevidí na prsia \na Pamela si pre prsia nevidí na strnisko.              ', 154, 4.19, 58),
	(14118, 'Ako zamotať žene hlavu?\nNasypete zrno do odstredivky.              ', 69, 3.33, 58),
	(14119, 'Po divokom mejdane sa chlap zobudí vedľa cudzej ženy a pýta sa:\n"Boha koľko máš rokov?"\n"Predsa toľko, na koľko vyzerám!"\n"Ma neser, tak dlho človek nežije!!!"              ', 185, 3.8, 58),
	(14120, 'Príde mladík do lekárne a pýta si:\n"Dajte mi, prosím jeden prezervatív, idem dnes na návštevu k svojej frajerke... Počkajte, radšej mi dajte dva, ona má aj celkom šikovnú sestru... Alebo nie! Dajte mi tri! Frajerkina matka tiež celkom dobre vyzerá..."\nTak sa aj stalo. Mladý muž prišiel na návštevu, pozvali ho k obedu \ni na kávu, no on celý čas iba sedel a červenal sa. Keď ho frajerka odprevádzala, pýta sa:\n"Čo je to dnes s tebou? Nechutil ti obed, že si taký zarazený...?"\n"Nie, obed bol chutný, no kto by si bol pomyslel, že tvoj otec je\nlekárnik..."              ', 603, 3.91, 58),
	(14121, 'Milenci sa v žite hrajú , okolie si nevšímajú. Kombajnista netuší, že túto hru preruší.              ', 112, 3.83, 58),
	(14122, 'Žena ide s obchodu a v jednej ruke nesie tri tašky a v druhej tiež. Oproti nej ide muž v čiernom, dlhom kabáte, zastaví sa pri žene a odhalí sa jej a nato žena vykríkne: Ježíš, zabudla som kúpiť vajcia.              ', 232, 3.86, 58),
	(14123, 'Ta dnešná mládež je márnotratná vraví jedna spermia druhej, keď stekajú dole umývadlom.              ', 111, 2.6, 58),
	(14124, 'Láska v Hollywoode:\n- Petty, ľúbiš ma? Chceš byť mojou?\n- Ó, dnes veľmi!\n- Pán hlavný, kňaza pre dve osoby!              ', 132, 3.2, 58),
	(14125, 'Viete, prečo muži nemajú prsia?\nLebo by sa s nimi celý deň hrali.              ', 84, 3.85, 58),
	(14126, 'Čo je to bozk?\n- Klopanie na poschodí, či je voľno na prízemí.              ', 82, 4, 58),
	(14127, 'Ty si naozaj ina ako ostatne dievcata. A ake su ostatne?\nPekné.              ', 78, 3.5, 58),
	(14128, 'Stretnú sa dvaja starí priatelia:\n"Ako sa máš, starec?", pýta sa prvý.\n"Ako melón," odpovedá druhý.\n"A to je ako?"\n"Bruško mi rastie a chvostík uschýna."\n', 166, 3.33, 58),
	(14129, 'Na maškarnom plese\nK úplne nahej žene, ktorá je celá natretá na bielo príde muž a pýta sa: \n"A vy ste aká maska?"\nŽena zdvihne nohu a vraví: \n"Zubný kaz."              ', 181, 3.38, 58),
	(14130, 'Chlapec nie a nie spustiť oči z dobre vyvinutej slečny.\nSlečna máte krásny sveter.\nĎakujem, je z pravej ťavej srsti. Hneď som si myslel keď som uvidel tie dva hrby.              ', 188, 4.14, 58),
	(14131, 'Manželka stojí večer v spálni pred zrkadlom a lamentuje:\r\n”Pleť zvráskavená, prsia ovisnuté, zadok ako pomaranč, kŕčové žily, vlasy mi nedržia...”\r\nCelá zúfalá sa obráti na manžela, aby jej povedal niečo pozitívneho. Z postele sa ozve:\r\n”No, zrak máš v poriadku...”              ', 310, 4.21, 58),
	(14132, 'Vraj aj žena po päťdesiatke môže dráždiť muža. \r\nA čím?\r\nKaždým slovom.              ', 98, 3, 58),
	(14133, '”Dúfam, že si si nepomyslela nič zlého, keď som sa vrátil ráno s monoklom?”\r\n”Ale kdeže, keď si sa vrátil, ešte si ho nemal!”              ', 158, 4, 58),
	(14134, '”Slečna, kde sa končia tie vaše krásne nohy?”\r\n”Tam, kde sa začínajú vaše záujmy!”\n', 100, 3.67, 58),
	(14135, 'Sťažuje sa susedka kamarátke:\r\n”Tento rok mi vrabce vyzobali skoro všetok mak. Musela som si dať do záhrady strašiaka.”\r\n”Ja nemám tento problém. Môj manžel je v záhrade celý deň.”              ', 216, 3.5, 58),
	(14136, 'Rozhovor na nudapláži:\r\n-Ja som Vierka.\r\n-Ja som Peter, teší ma.\r\n-Vidím...              ', 94, 4.1, 58),
	(14137, 'Rozhovor v krčme:\r\n"Počúvaj, nevieš, o čom sa rozprávajú ženy medzi sebou, keď sú samé?"\r\n"No o tom o čom aj chlapi."\r\n"Hej? Svine!"\n', 145, 3.8, 58),
	(14138, 'Chlapík na nádraží osloví slečnu ťahajúcu ťažký kufor.\r\n"Slečna, nebolí vás z toho ruka?"\r\n"Áno." odpovie slečna v očakávaní galantnej pomoci.\r\n"Tak prečo si to neprehodíte do druhej?"              ', 219, 3.9, 58),
	(14139, 'Stretnú sa dvaja chlapi. Jeden vraví:\r\n"Karol, veď ty máš holú hlavu ako zadok mojej ženy!"\r\nKarol si prejde rukou po hlave a vraví:\r\n"No áno, vážne!"              ', 175, 3.86, 58),
	(14140, 'Hádajú sa traja chlapi, čia žena má väčší zadok. Prvý vraví: \r\n"Ja keď idem do kina so svojou starou, tak jej musím kúpiť dva lístky."\r\nDruhý sa ohradí:\r\n"To je nič. Ja keď idem s rodinou na návštevu, tak moja žena si sadne na pohovku a ja s deťmi stojíme celý čas za ňou, lebo si nemáme kde sadnúť."\r\nA ten tretí sa len tak smutne pozrel a prehodil:\r\n"Moja žena má pekné oči."\r\n"Ale veď sa nerozprávame o očiach." vravia ďalší dvaja.\r\n"No hej, ale keď všetko ostatné je ten zadok!"              ', 541, 3.8, 58),
	(14141, 'Dve ženy sa bavia o práve strávenej dovolenke: \r\n"Tak čo, ako si sa mala pri mori?"\r\n"Ale, ani sa nepýtaj. Mala som so sebou úplne zbytočné veci."\r\n"A čo napríklad?"\r\n"Manžela a deti!"              ', 209, 3.67, 58),
	(14142, 'Žena a muž mali vytvoriť vetu, v ktorej budú slová ”milovať” a ”sex”.\r\nŽena napísala: ”Keď sa dvaja úprimne a hlboko milujú a vzájomne si seba vysoko vážia, tak spoločnosť morálne aj spirituálne akceptuje, že títo dvaja sa ponoria do sladkého opojenia fyzického sexu.” \r\nMuž napísal: ”Milujem sex.”              ', 352, 3.47, 58),
	(14143, '”Drahá, musím sa ti k niečomu priznať! Som ženatý!”\r\n”Fuj, to som sa zľakla! Už som si myslela, že ti ukradli auto!”              ', 147, 3.83, 58),
	(14144, 'Dvaja programátori sedia v bare. Okolo prejde poriadne prsnatá baba. Jeden vraví:\r\n”Bože, tá má iné properties!”\r\n”Ehm..., včera som to čekoval, všetky sú read only!” smutne dodá druhý.               ', 221, 3, 58),
	(14145, 'Žena posiela manžela - programátora - na nákup: \r\n”Choď kúpiť dve nožičky klobásy. A keď budú mať vajíčka, zober desať.”\r\nProgramátor vojde do obchodu:\r\n”Dobrý deň, máte vajíčka?”\r\n”Áno.”\r\n”Tak mi dajte desať nožičiek klobásy.”              ', 284, 3.9, 58),
	(14146, 'Z listu:\r\n”Drahá, odpusť mi, že som minulý týždeň neprišiel k tebe, ale boli sme s kamarátmi popoludní v krčme a potom som dva dni nemohol prísť k sebe, nieto ešte k tebe.”              ', 204, 3.9, 58),
	(14147, 'Boh stvoril Adama a Evu a ostali mu ešte dve veci, ktoré im chcel dať. Boh im povedal:\r\n”Mám pre vás dva darčeky - pre každého jeden. Ten prvý je schopnosť močiť postojačky.”\r\nAdam ho prerušil a zvolal:\r\n”To chcem, to chcem ja! Môj život bude omnoho jednoduchší a veselší!”\r\nEva bola za, tak súhlasila. Tak Adam dostal od Boha tento dar. Výskal od ra-osti, poskakoval, močil tu i tam a obdivoval obrazy, ktoré sa mu podarilo vytvoriť v piesku. Boh s Evou chvíľu pozorovali Adamovo nadšenie a potom sa Eva pýta Boha:\r\n”Bože, a ten druhý dar, ktorý si nám chcel dať?”\r\n”To je mozog, Eva. To je mozog.”              ', 663, 4, 58),
	(14148, 'Vraví Peťko mame:\r\n”Mami, dnes som videl u pána farára Pannu Máriu.”\r\n”Netáraj, synak!”\r\n”Naozaj! Vyprevádzal ju k dverám a hovoril pri tom: ”Panenka Mária, utekaj rýchlo preč, lebo ťa niekto uvidí...”              ', 242, 3.8, 58),
	(14149, 'Pani, vy ste sliepka!”\r\n”Kto kto kto kto já?”              ', 66, 4.15, 58),
	(14150, 'Viete aký je rozdiel medzi ženou a fazuľou?\r\nŽe vraj žiadny: obidve, keď nemajú pevný kolík odplazia sa k susedovi.              ', 138, 3.4, 58),
	(14151, '”Drahá, čo tak dnes večer niekam vyraziť a užiť si života?” hovorí Fero Mare.\r\n”Súhlasím, drahý. Ale keby si prišiel domov prv než ja, nechaj svietiť v predsieni.”              ', 199, 1.8, 58),
	(14152, 'Rozdiel medzi mužom a vibrátorom spočíva v tom, že jeden je chladný, bez duše a  akýchkoľvek citov a do druhého treba baterky.              ', 150, 3, 58),
	(14153, 'Vbehne malá Veronka do kuchyne za mamou\r\na vraví:\r\n”Mami, musím si s tebou prehovoriť ako žena\r\nso ženou.”\r\n”Nó..., prosím.”\r\n”Mami, môžem dnes popoludní prísť do druhého stavu?”\r\n”Veronka, to je v tvojom veku vylúčené!”\r\n”Vieš to na sto percent?”\r\n”Samozrejme. Je to vylúčené!”\r\nVeronka sa vykloní z okna a radostne volá do ulice:\r\n”Peťko, tak súhlasím! Popoludní...”              ', 437, 3.42, 58),
	(14154, 'Príde manžel domov skôr zo služobnej cesty. Doma nájde svoju ženu holú na posteli a pýta sa: Perčo sedíš holá?\r\nManželka odpovedá: No to je tak. Nemám šaty. Manžel otvorí skryňu a počíta: Prvé, druhé, tretie, čau Fero, štvrté šaty...              ', 274, 3.7, 58),
	(14155, 'Pani Novákovej priviezli uhlie. Vykloní sa z okna len v podprsenke a pýta sa, koľko to bude stáť.\r\n”1200 korún, pani.” odpovedajú chlapi.\r\nPani Nováková vyhodí kozu z podprsenky a znovu sa pýta:\r\n”A nejaká zľava by nemohla byť?”\r\n”Kdeže, milá pani, to nejde.”\r\nIde teda dole len v spodnom prádle, otvorí, začne sa vykrúcať, poťahuje si nohavičky a znovu prosí:\r\n”No tak, chlapci, poďte na pohárik, dohodneme sa.”\r\n”Nie, nie, pani Nováková, to naozaj nepôjde,” odmietajú chlapi, ”my sme dnes premrdali už tri fúry.”              ', 585, 3.5, 58),
	(14156, 'Pán pri prechádzke parkom zbadal atraktívnu slečnu, ktorá líže zmrzlinu a takto sa jej prihovára:\r\n”Slečna, môžem sa vás niečo opýtať?”\r\nOna odpovedá:\r\n”Iste, pýtajte sa.”\r\n”Ale bojím sa, že si to budete zle vysvetľovať.”\r\n”Už keď ste ma na to dopredu upozornili, tak si to nebudem zle vysvetľovať.”\r\n”Dáte mi líznuť?”\r\nSlečna mu ponúka zmrzlinu a pán jej hovorí:\r\n”No vidíte, vravel som vám, že si to budete zle vysvetľovať ...”              ', 504, 4.18, 58),
	(14157, 'Mladá žena sa sťažuje, že nemôže otehotnieť. Lekár sa pýta:\r\n”Ako to robíte?”\r\n”Odzadu.”\r\n”Tak skúste normálnu polohu.”\r\n”Ale to by sme potom nemohli pozerať televízor!”              ', 214, 3.14, 58),
	(14158, 'Ferova manželka rodí a on čaká na chodbe v pôrodnici. Časom vyjde sestrička a informuje ho:\r\n”Gratulujem! Máte trojčatá.”\r\n”To mám ale rúru! Čo?!” nadšene a hrdo poznamená Fero.\r\n”No to máte! Ale mali by ste si ju nechať vymiesť. Všetky tri deti sú totiž čierne.”              ', 311, 3.67, 58),
	(14159, 'Dvaja muži sa zhovárajú:\r\nM1:Ja mám takú hroznú ženu....čo by si mi poradil aby čo najviac trpela?\r\nM2:Daj ju do miestnosti plnú krásnych šiat\r\nM1:To je utrpenie?\r\nM2:Nie, ale nebude tam mať zrkadlo.              ', 226, 3.5, 58),
	(14160, 'Mladík v kvetinárstve:\r\n”Aké kvety mám kúpiť svojej priateľke?”\r\n”Ak ju chcete hladkať, kúpte jej ruže. Ak ju chcete bozkávať, kúpte jej narcisy.”\r\n”Viem presne, čo s ňou chcem robiť. Kúpim jej kaktus.”              ', 245, 3.29, 58),
	(14161, 'Doktor na gynekologickom oddelení v nemocnici má vizitu. Vojde do jednej izby a pýta sa prvej pacientky:\r\n”Tak, mamička, kedy to čakáte?”\r\n”Dvadsiateho piateho, pán doktor.”\r\nPríde k druhej pacientke a tiež sa jej pýta:\r\n”A kedy to čakáte vy?”\r\n”Tiež dvadsiateho piateho.”\r\n”A vy tiež dvadsiateho piateho?” pýta sa tretej pacientky.\r\n”Nie, ja som s nimi na tom školení nebola.”              ', 432, 3.86, 58),
	(14162, '”Slečna, môžem sa za 10 dolárov chvíľu na vás pozerať?”\r\n”Nech sa páči.”\r\n”A za 20 dolárov by som vás mohol pobozkať?”\r\n”Ako si prajete.”\r\n”A za 50 dolárov by som si mohol pohladkať vaše poprsie?”\r\n”Pokojne.”\r\n”A koľko by stálo, keby som sa chcel s vami vyspať?”\r\n”Ako obvykle, 5 dolárov za číslo.”               ', 367, 3.67, 58),
	(14163, 'Šepká snúbenec svojej nastávajúcej:\r\n”Drahá, zarábam 50 000 korún mesačne. Dokážeš z toho vyžiť?”\r\n”Ja áno. Ale z čoho budeš žiť ty?”              ', 174, 3.5, 58),
	(14164, '”Nazdar, Peter! Počul som, že ti žena rozbila nové Porsche.”\r\n”To áno...”\r\n”A stalo sa jej niečo?”\r\n”Ešte nič, stihla sa zamknúť v kúpeľni.”              ', 182, 3.9, 58),
	(14165, '”Počul som, že bozkávanie sa je nebezpečná vec. Vraj pritom možno chytiť kadejakú pliagu.”\r\n”To je pravda.  Ja som tak chytil svoju starú!”              ', 170, 3.2, 58),
	(14166, 'Žena vraví milému:\r\n”Miláčik, kým sa spolu zosobášime, musíš mi ešte sľúbiť, že ma budeš bozkávať\r\nna miestach, kde ma ešte nikto predtým nebozkával.”\r\n”Dobre láska moja, ktoré sú to miestečká?”\r\n”Napríklad Kanárske ostrovy, Seychelly, Maurícius...”              ', 304, 3.38, 58),
	(14167, '”Drahá, dnes večer ti prinesiem modré z neba!”\r\n”Ja nechcem žiadne modré z neba. Pekne budeš doma sedieť!”              ', 135, 3, 58),
	(14168, 'Snúbenec vraví svojej vyvolenej:\r\n”Drahá, sľubujem ti, že so mnou sa budeš mať ako v raji.”\r\n”Ďakujem, mám tomu rozumieť tak, že nebudem mať čo na seba?”              ', 188, 3.9, 58),
	(14169, 'Mladík chce zaimponovať na prvej schôdzke,\r\na tak hovorí:\r\n”I love you.”\r\nDievča je už skúsenejšie, takže odpovie:\r\n”I love you too.”\r\nChlapec je touto pokročilou cudzojazyčnou konverzáciou mierne zaskočený a v rozpakoch zašepká:\r\n”I love you three.”               ', 293, 3.6, 58),
	(14170, 'Na rande sa Žofka s obdivom\r\npozerá na Jožove nové švajčiarske hodinky.\r\n”Páni, Joži, to sú hodinky.\r\nUž sa nečudujem, že na ne\r\nv kuse hľadíš.”\r\n”To sú super hodinky.\r\nNielenže mi povedia koľko je hodín hocikde na svete,\r\nale aj to, že nemáš na sebe nohavičky.”\r\n”Asi sú pokazené, lebo ja nohavičky na sebe mám!”\r\nNato Jožo znechutene pokrúti hlavou:\r\n”Do kelu, zase idú dopredu.”              ', 441, 3.5, 58),
	(14171, 'Pekná mladá slečna kráča po ulici. Mladý muž sa jej pýta:\r\n”Slečna, kam kráčajú tie pekné nohy?”\r\n”Ak sa medzi ne nič nepripletie, tak do kina.”              ', 180, 3.86, 58),
	(14172, 'Párik, po milovaní, leží v posteli:\r\nOn: “Miláčik, čo keby som zajtra prišiel k vám a pred všetkými ťa požiadal o ruku?”\r\nOna: “Hmm. Manžel by asi zúril a deti by zomreli od smiechu.”              ', 220, 3.75, 58),
	(14173, 'Jack, obchodný zástupca, je na svojom novom pracovisku zavalený prácou a po psychicky náročnom dni sa rozhodne dopriať si nejakú relaxáciu v miestnom verejnom dome. Bohužiaľ, je práve špička, takže voľná je jedine jedna slečna, ktorá pochádza z Číny a nevie ani slovo po anglicky. Ale inak je to kus, tak Jack sa do toho dá. Odvedie ju do izby a pekne sa do nej pustí zozadu, čo to dá. Dievča veľmi skoro začne nahlas kričať:\r\n- Sung wa! Sung wa!\r\nJack je na seba patrične hrdý, takže mu hneď dojde, že dievčina si jeho výkon pochvaľuje a tieto slová znamenajú asi niečo ako “to je skvelé”, takže ešte pridá. Na druhý deň ide Jack hrať golf s jedným bohatým čínskym klientom. Tomu sa podarí hneď na druhej jamke trafiť prvou ranou rovno do jamky. Jack rozmýšľa, že hneď použije novú frázu, čo sa naučil a volá:\r\n- Sung wa! Sung wa!\r\nKlient sa zarazí a hovorí:\r\n- Čo tým myslíte, zlá diera?!?              ', 982, 3.62, 58),
	(14174, 'Súloží chlap so ženou. Najprv je on na nej, po chvíli mu žena začne prehrabovť vlasy. Pýta sa jej:\r\n- Čo robíš?\r\n- Hľadám rohy.\r\n- A prečo?\r\n- Petože to robíš ako diabol.\r\nO chviľu sa vymenia, žena je hore. Po chvíli aj muž jej začne šmátrať po hlave a žena sa pýta:\r\n- Hľadáš rohy?\r\n- Áno.\r\n- Tiež to robím ako diablica?\r\n- Nie, ale si ťažká ako krava.              ', 404, 3.92, 58),
	(14175, 'Na stenu hotela, za ktorou hlučne chrápe muž, zúfalo búcha mladá žena. Ráno sa náhodou stretnú pri stole a muž vraví:\r\n- Prepáčte, slečna. Počul som, ako ste ťukali na stenu, ale bol som príšerne uťahaný.              ', 239, 3.5, 58),
	(14176, 'Muž v bare hovorí žene:\r\n- Slečna, chcel by som vám zavolať.\r\n- Dobre, moje číslo je v telefónnom zozname.\r\n- Ale, neviem ako sa voláte.\r\n- Nevadí, meno je tam tiež.              ', 191, 4.17, 58),
	(14177, 'Muž príde domov a udivene sa pýta:\r\n- Drahá, je to možné, aby náš tamagotchi otehotnel?\r\n- Ukáž?\r\nMuž vyťahuje z vrecka “tamagotchiho”, ukazuje na displej a na ňom nápis: “Som tehotná”.\r\n-Ty dilino, to nie je tamagotchi, to je pager!              ', 270, 3.14, 58),
	(14178, 'Stretne mladý pán vo vlaku mladú krásnu dámu a hovorí:,,Dobrý deň ,chcem vám povedať, že máte veľmi krásne silonky oblečené".\r\nA mladá dáma na to:,,Ó áno ďakujem vám, na jednej nohe mám znázornené Vianoce a na druhej nohe mám znázornený Nový rok."\r\nA pán na to:,,Sú naozaj pekné, nemohol by som vás prísť navštíviť niekedy medzi sviatkami?               ', 392, 3.95, 58),
	(14179, 'Fero išiel na výlet do Paríža. Všetko popozeral a večer si zašiel aj do parížskeho bordelu. Ráno odtial vychádza:\r\n- Tpfuj! - odpľul si veľký chriakeľ na chodník.\r\nTu sa spoza rohu vynoril policajt a naparil mu za pľuvanec pokutu 50Euro. Keď sa vrátil domov, Mara sa ho pýta:\r\n- No ako bolo v Paríži?\r\n- Super... nádhera... - odvetí Fero.\r\n- A na mňa, svoju ženušku, si si v tej nádhere spomenul?\r\n- Hej! Raz som si spomenul... a stálo ma to 50 Euro.\n', 480, 3.83, 58),
	(14180, 'Cársky dôstojníci na bále. Jeden hovorí:\r\n"Ak dnes poručík Rzevskij nezačne hneď po príchode hovoriť nejaké oplzlosti, na mieste sa zastrelím!"\r\nO chvíľu prichádza poručík Rzevskij:\r\n"Páni, pohovorme si dnes o hudbe..." Ozval sa výstrel.\r\nA Rzevskij pokračuje:\r\n"... napríklad ráno som Natašu vytrtkal na klavíri."              ', 353, 3.57, 58),
	(14181, 'Stále sa držíme za ruky. Keď ju pustím, mizne v obchodoch.\n', 64, 3.13, 58),
	(14182, '- Viete, že v pive sú ženské hormóny?\r\n- Zistilo sa, že 80% mužov po vypití 10 pív nedokáže vytvoriť súvislú vetu ani riadiť auto.              ', 159, 3.11, 58),
	(14183, 'Viete o tom, že v pive sú ženské hormóny?\r\nBolo zistené, že 75% mužov, po vypití 10 pív nedokáže vytvoriť súvislú vetu ani šoférovať auto.\n', 157, 2.71, 58),
	(14184, '- Prestaň! Povedal si, že ma len trošku pošteklíš prstíkom v pupčeku. A to už nie je pupček!\r\n- Veď ani to už nie je prstík ...\n', 141, 3.25, 58),
	(14185, 'Príde muž do drogérie a hovorí predavačke:\r\n- Prosím si kabátik na chlapčeka. Predavačka mu podá balíček prezervatívov a vraví:\r\n- Tu máte kabátik a keby ste chceli aj kožušinový golier, tak o šiestej končím.\n', 231, 3.83, 58),
	(14187, 'Otázka:	Možno uterákom zabiť svokru?\r\nOdpoveď:	Možno. Keď je v ňom žehlička.              ', 100, 4, 58),
	(14188, '- Vaša žena vás prosí, aby ste prišli k telefónu!\r\n- Prosí? Tak to určite nie je moja žena.              ', 114, 3.5, 58),
	(14189, '- Slečna, čo by som vám musel dať, aby som vás mohol pobozkať?\r\n- Narkózu!              ', 95, 3.56, 58),
	(14190, '- Smiem prosiť?\r\n- S deckom netancujem.\r\n- Pardón nevedel som, že ste tehotná!              ', 96, 3.86, 58),
	(14191, '- Kúpil som dcérke husle. Myslel som si, že ju to privedie k hudbe, ale nejako to nepomohlo.\r\n- To poznám. Tiež som raz svokre kúpil kufor...              ', 161, 3.63, 58),
	(14192, '- Ktoré ženy máš najradšej? Také, čo stále rozprávajú alebo iné? \r\n- Aké iné?\n', 91, 3, 58),
	(14193, '- Ty, Jarmilka, dnes by to možno šlo.\r\n- A čo ako?\r\n- Pozri sa z okna. Slnko svieti, na nebi ani mráčik.\r\n- A čo má, ako byť?\r\n- No, vravela si predsa, že sa jedného krásneho dňa zoberieš a odídeš.              ', 226, 3.8, 58),
	(14194, '- Koľko máte bratov, mladý muž?\r\n- Jedného.\r\n- Zaujímavé. Vaša sestra mi povedala, že má dvoch bratov.              ', 126, 2.6, 58),
	(14195, '- Aké tri najväčšie krízy prežíva vo svojom živote muž?\r\n- Kopačky od ženy, stratu zamestnania a škarabanec na aute.              ', 142, 3.2, 58),
	(14196, 'Chlapík v bare balí perfektnú blondínku:\r\n- A čo keby som ti niekedy zavolal?\r\n- Fajn, moje číslo je v zozname.\r\n- Ale neviem ani ako sa voláš.\r\n- Meno je tam tiež...\n', 177, 2.75, 58),
	(14197, 'Vonku husto sneží. U Novákovcov ktosi klope na dvere. Muž ide otvoriť a pred dverami stojí svokra. Keď ju zbadá hovorí: \r\n- Mama, prečo tu stojíte? Prečo radšej nejdete domov?\n', 189, 3.67, 58),
	(14198, 'Kabeš - policajt sa pýta zadržaného: \r\n- Čo ste robili včera medzi desiatou hodinou večer a šiestou ráno?\r\n- Prečo to chcete vedieť?\r\n- Pretože moja manželka mi hovorila, nech sa niekde spýtam, čo robia chlapi v noci...              ', 248, 3.92, 58),
	(14199, 'Muž vraví žene, ktorá si už hodinu vyberá topánky:\r\n- Kúp si tieto...\r\n- Preboha, veď také už nik nenosí!\r\n- Tak si vezmi tie druhé!\r\n- Zbláznil si sa?! Veď také nosia teraz všetky ženy!              ', 218, 3.8, 58),
	(14200, 'Pripomínaš mi plavbu po oceáne.\r\nViem, som divoký, romantický, nespokojný!\r\nNie, je mi z teba nanič!              ', 121, 3, 58),
	(14201, 'Leží MatFyzák vedľa MatFyzáčky v posteli.... Naraz sa k nemu MatFyzáčka privinie a hovorí:\r\n- Myslíš na to, čo ja ?\r\n- Nó, myslím..\r\n- A koľko ti to vyšlo ???"              ', 189, 3, 58),
	(14202, 'Pri barovom pulte sedí dobre vyzerajúci podnikateľ. Príde k nemu blondínka a hovorí mu: "Za 2000-ku ti spravím čo len budeš chcieť, ale musíš mi to povedať tromi peknými slovami." Podnikateľ chvíľu rozmýšľa, vytiahne z peňaženky 2000 korún a povie: "Vymaľuj mi barák."              ', 307, 3.72, 58),
	(14203, 'Mladík cestuje v kupé s neznámou slečnou. Keď ho dlhé ticho prestane baviť, osloví ju:\r\n- Prečo stále mlčíte, slečna?\r\n- Mlčím, pretože chcem! odsekne slečna.\r\nMladík vyskočí a spľaskne rukami: \r\n- Tak ona chce a mlčí!?              ', 256, 3.5, 58),
	(14204, 'Pán Karol má na návšteve dve atraktívne priateľky. Pripravuje im v kuchyni pohostenie. Na tanieri sa skvejú nejaké mäsové pochutiny, obložené uhorkou a vňaťou. Dámy maškrtia a pán Karol vraví: \r\n„Tak čo, kočky, ako Vám chutí Whiskas ?"               ', 274, 3.4, 58),
	(14205, '\r\n- Pán doktor, každú noc sa mi sníva strašný sen. Idem po ulici a vidím svoju svokru, ako vedie na vodítku krokodíla. A ešte teraz sa trasiem od strachu, keď vidím tie žlté oči, zelenkavú kožu s bradavicami a ohromné zubále, ktoré ma chcú roztrhať.\r\nDoktor zvolá:\r\n- To je strašné, veď aj ja som sa teraz zľakol!!!\r\n- Ale to ešte nič nie je, pán doktor, teraz vám opíšem toho krokodíla!\n', 422, 3.74, 58),
	(14206, 'Jožo sa vrátil z krčmy domov. V predsieni vidí svokru s metlou v ruke, tak sa spýta:\r\n- Už odlietate...?              ', 124, 4.14, 58),
	(14207, 'Irmuška je veľmi dobrá žena. Vždy keď sa jej manžel vráti domov neskoro večer, tak hneď ako vstúpi do dverí, dostane svoju fajku, papuče, pyžamo, knihu, kávu, večeru a všetko ostatné, čo jej príde pod ruku, hodí po ňom tiež.\n', 248, 4.23, 58),
	(14208, '„Ak ma odmietneš, zomriem."\r\nOna ho odmietla a za šesťdesiat rokov naozaj zomrel.               ', 101, 3.63, 58),
	(14209, 'Dievčatko sa díva na svoju mamičku, ako si oblieka nový kožuch.\r\n"Mami, uvedomuješ si, že kvôli tomu, aby si si toto mohla obliecť, muselo to úbohé zviera strašne trpieť?"\r\nMama sa pozrie prísne na dcéru:\r\n"Čo si to dovoľuješ, takto hovoriť o svojom otcovi?!"              ', 292, 4, 58),
	(14210, 'Lekár sa pýta pacienta. Kedy ste prestali piť?\r\nPacient: Keď som začal vidieť svokru dvojmo.              ', 112, 3, 58),
	(14211, 'Vymením muža za husle.\r\nZnačka: Drevo ako drevo.              ', 65, 3.77, 58),
	(14212, 'Smetiari odvážajú kontajner. Blíži sa stará Nováková s odpadkovým košom a volá:\r\n- Dúfam, že nejdem neskoro?\r\n- Ale kdeže, naskočte si.              ', 164, 3.67, 58),
	(14213, 'Muž príde domov a hovorí žene:\r\n- Prosím ťa, správaj sa dnes ku mne ako k psovi.\r\nŽena sa čuduje a pýta sa ako to je. Muž odpovedá:\r\n- Jednoducho. Daj mi najesť a pusti ma von.              ', 203, 3.71, 58),
	(14214, 'Po hádke hovorí manželka manželovi:\r\n"Nebyť teba, boli by sme ideálny pár!"              ', 96, 4.21, 58),
	(14215, 'Raz sa na večierku, usporiadanom britskou vládou, stretne Churchill s poslankyňou, ktorá ho vyložene nemá rada, a tá mu hovorí:\r\nPán premiér, keby som ja bola vaša žena, dala by som vám do čaju jed.  Lady, keby ste vy bola moja žena, s chuťou by som ten čaj vypil. \n', 283, 4.09, 58),
	(14216, 'Raz sa na večierku, usporiadanom britskou vládou, stretne Churchill s jednou poslankyňou, ktorá ho vyložene nemá rada, a tá mu hovorí:\r\n"Pán premiér, vy ste hrozne, ale hrozne opitý."\r\n"Lady, vy ste zas hrozne škaredá. Lenže ja, na sa na rozdiel od vás z toho do rána vyspím."\n', 294, 3.8, 58),
	(14217, 'Na spoveď príde žena, že má hriešne myšlienky:\r\n"Stále si myslím, že som krásna a zvodná."\r\nFarár na ňu pozrie a hovorí:\r\n"To nie je hriech, to je omyl."\n', 169, 3.44, 58),
	(14218, '"Rodičia mi s tebou zakázali chodiť."\r\n"To nevadí, nájdem si inú..."\n', 75, 3.52, 58),
	(14219, 'Tóno išiel navštíviť priateľa. Našiel ho v kuchyni kľačať a drhnúť podlahu.\r\n"No toto by ma ani vo sne nenapadlo."\r\n"Mňa tiež nie, to je nápad mojej starej."\n', 173, 4.07, 58),
	(14220, '"Miláčik, musíš mi na každú otázku odpovedať otázkou?"\r\n"Skutočne to robím?"\n', 88, 3.85, 58),
	(14221, '"Vždy znovu žasnem, ako krásne vyzeráš po troch pohárikoch whisky!" \r\n"Ale ja som vôbec nepila!"\r\n"Ale ja áno."\n', 120, 3.5, 58),
	(14222, 'Jedna vdova si dala inzerát:\r\n"Hľadám priateľa menšej postavy, ktorý ma rád zábavu, ryby a hry v kolektíve."\r\nPrišla jej odpoveď:\r\n"Kúpte si tučniaka!"\n', 165, 3, 58),
	(14223, 'Chytí rybár striebornú rybku:\r\n"Nezabíjaj ma splním ti prianie!"\r\n"Dobre, nech už nie je vojna v Čečensku." \r\n"To je veľké prianie, ja som len strieborná rybka."\r\n"Tak dobre, nech mám krajšiu ženu."\r\n"Nemáš jej fotku?"\r\nRybár je ukáže fotku ženy, rybka sa na ňu díva a potom sa spýta:\r\n"Čo si to chcel s tým Čečenskom?"\n', 347, 3.79, 58),
	(14224, '"Moja najdrahšia. Staň sa mojou ženou. Nemám síce chatu ako Fero, nevyhral som 300 000 v športke ako Fero, nemám BMW ako Fero, ale nemôžem bez teba existovať."\r\n"Ja ťa mám tiež strašne rada, ale povedz mi, kde býva ten Fero?"\n', 241, 4.21, 58),
	(14225, 'Viete, o čo prichádza slobodná žena?\r\nO pivné kecy do dojímavého filmu a o funenie pri nesení dvoch tašiek.\n', 117, 2.77, 58),
	(14226, 'Chlapík hovoril, že mu ukradli kreditku, ale nenahlásil to, pretože ten zlodej utráca menej než manželka.\n', 113, 2.75, 58),
	(14227, 'Chlap osloví slečnu, ťahajúcu ťažký kufor.\r\n"Slečna nebolí vás z toho ruka?"\r\n"Áno," odpovie slečna v očakávaní galantnej pomoci.\r\n"Tak prečo si to neprechytíte?"\n', 180, 3.75, 58),
	(14228, 'Ak hľadáš muža, ktorý je príťažlivý, vtipný, múdry, sebavedomý, citlivý, sexy, nežný a romantický, choď do kina.\n', 130, 3.5, 58),
	(14229, 'Trosečník žije už jedenásť rokov na pustom ostrove sám, keď mu zrazu more vyplaví ženu.\r\nŽena: Tak dlho si na to čakal a teraz to máš!\r\nTrosečník: Ty máš pivo???\n', 180, 4, 58),
	(14230, 'Kedy chlap pomyslí na večeru pri sviečkach?\r\nLen vtedy, keď vypnú prúd.\n', 78, 3.4, 58),
	(14231, 'Aký je rozdiel medzi pohovkou a chlapom, čo pozerá na futbal?\r\nPohovka si stále nepýta pivo.\n', 98, 3.5, 58),
	(14232, '"Pán kolega, čo tá rozbitá hlava?"\r\n"Jedna žena mi dala košom."\r\n"Ale, a kde?"\r\n"V samoobsluhe."\n', 103, 3.33, 58),
	(14233, 'Pri tanci hovorí významne žena partnerovi:\r\n"Cítim sa tak opustená. Manžel odišiel na mesiac do Londýna."\r\n"Mohla by ste mi schovať známky, ak vám bude písať?"\n', 173, 4, 58),
	(14234, '"Vonku je tak krásne," hovorí muž manželke, "a ty sa tu drieš s parketami!\r\nMala by si ísť radšej na vzduch a umyť mi auto."\n', 134, 3.33, 58),
	(14235, 'Domáce práce:\r\nVeci, ktoré žena robí a nikto si ich nevšimne, pokým ich neprestane robiť.\n', 98, 3.87, 58),
	(14236, 'Vdova:\r\nŽena, ktorá na svojom mužovi nemôže nájsť jedinú chybičku.\n', 76, 2.78, 58),
	(14237, 'Na lodi prosia slečny námorníka, aby im povedal vtip. Námorník sa ošíva, že pozná len neslušné. A dievčatá na to, že nech namiesto neslušného slova zakašle. Že už si to domyslia.\r\n Námorník spustí:\r\n"Echm, echm echm echm. Echm, chm echm chrchly chrchly, echm... Do prdele, teraz som to dosral."\n', 317, 3, 58),
	(14238, 'Zaľúbený mládenec padol na kolená pred dievčaťom svojich snov. Prosí ju o ruku.\r\n"Neexistuje!" odsekne dievča.\r\n"Môj budúci manžel musí zarábať aspoň 50 tisíc."\r\n"Musí vedieť variť, upratovať, všetko opraviť a splniť mi každé prianie."\r\n"No dobre! Ale keď už kľačím, dovoľte mi, aby som sa za toho chudáka pomodlil!!!"\n', 352, 3.8, 58),
	(14239, 'Hovorí jedna:\r\n"Ko ko ko komu hovoríš slepica, máme rovnaký kvo kvo kvocient ako muži!"\n', 94, 3.4, 58),
	(14240, 'Pán Novák je na návšteve a pochvaľuje si:\r\n- To je ale dobrá káva.\r\n- Manžel ju priniesol až z Brazílie. - vraví susedka.\r\n- Nehovorte! A ešte je teplá.              ', 179, 3.94, 58),
	(14241, 'Pýta sa jeden druhého:\r\n- Čo si taký smutný?\r\n- Ale, moje dievča sa vydáva.\r\n- No toto? A za koho?\r\n- Za mňa...              ', 133, 4.06, 58),
	(14242, 'Počas prednášky hovorí profesor študentovi:\r\n- Okamžite zobuďte svojho kolegu!\r\n- Prečo ja? Veď vy ste ho uspali!\n', 123, 3.67, 58),
	(14243, 'Prečo Boh stvoril ženu tak, že Adamovi zobral jedno rebro?\r\nAby demonštroval, že z krádeže nevzíde nič dobré.\n', 120, 3.71, 58),
	(14244, 'O druhej v noci budí žena manžela:\r\n- Drahý, mám strašnú chuť na chlapa!\r\nOn sa posadí a hovorí:\r\n- Do kelu, koho ti teraz v noci zoženiem?!\n\n', 153, 3.93, 58),
	(14245, 'Na stenu hotelovej izby za ktorou neskutočne hlučne chrápe akýsi chlap,\r\nzúfalo búcha mladá dáma. Ráno sa stretnú na chodne a chlap sa ospravedlňuje:\r\n- Prepáčte, slečna, ja som vás počul, ako ťukáte, ale bol som hrozne unavený...              ', 263, 3.6, 58),
	(14246, 'Koľko chlapov je potrebných na výmenu jednej rolky toaletného papiera? \r\nNikto nevie, zatiaľ sa to ešte nikdy nestalo.              ', 138, 2.57, 58),
	(14247, 'V tlačenici pred hotelovým výťahom mládenec nechtiac buchol mladé dievča lakťom do prsníka:\r\n“Prepáčte, slečna! Ak máte aj srdce take mäkké ako prsia, tak mi určite odpustíte.”\r\n“Odpúšťam vám. A pre prípad, že máte všetko také tvrdé ako lakte, bývam na čísle 318.“\n', 303, 4.22, 58),
	(14248, 'Žena raz večer hovorí: “Dve veci viem najlepšie. Fašírku a štrúdľu.”\r\nA manžel sa znechutene spýta. “A toto je ktorá?”\n', 139, 3.44, 58),
	(14249, 'Marienka hovorí Jankovi.\r\n- Príď večer k nám, nikto nebude doma. Janko sa doma oholil, okúpal, navoňal a išiel večer k Marienke. Búcha, zvoní, ale nikto neotvára. Marienka neklamala, nikto nebol doma.              ', 226, 3.93, 58),
	(14250, 'Ona: Drahý, videl si už pokrčenú stokorunáčku?\r\nOn: Áno\r\nOna: A pokrčenú tisíckorunáčku?\r\nOn: Áno\r\nOna: A pokrčeného pol milióna?\r\nOn: Nie, prečo?\r\nOna: Tak poď sa pozrieť do našej garáže.              ', 224, 3.5, 58),
	(14251, 'Ženy majú tri životé obdobia :\r\nV prvom idú na nervy svojmu otcovi,\r\nv druhom mužovi a v treťom svojmu zaťovi.\n', 119, 3.86, 58),
	(14252, '“Uvidíme sa zajtra?” pýta sa muž dievčiny po milovaní.\r\n“Zajtra to nepôjde,” pokrúti dievča hlavou, “to sa akurát vydávam, ale pozajtra by to šlo...”              ', 186, 4.16, 58),
	(14253, 'Pán a pani, ktorí sa navzájom vôbec nepoznajú, cestujú spoločne v lôžkovom vagóne. Vo vagóne sa však nekúri a panej začne byť zima. Požiada preto pána:\r\n- Boli by ste taký láskavý a podali by ste mi inú deku?\r\n- Ja by som vedel o niečom lepšom - zahrajme sa na manželov. - vraví pán.\r\n- Vy drzáň... no, tak dobre.\r\nPán na to:\r\n-Tak si pre tú hlúpu deku zájdi sama!\n', 397, 3.64, 58),
	(14254, 'Dva páry vyrazia spolu na víkend do prímorského hotela. Po dobrej večeri a niekoľkých pohárikoch v bare niekto navrhne, že by si mohli na noc vymeniť partnerov. Po dvoch hodinách intenzívneho sexu sa chlapík otočí nabok a vraví:\r\n- Paráda, takto som si už dlho neužil. Dúfam, že dievčatám je tiež tak dobre.\n', 332, 4, 58),
	(14255, '"Miláčik, je pravda, že holuby sú najhlúpejšie vtáky?" "Áno, holubička moja."              ', 100, 3.25, 58),
	(14256, 'Pán Novák v krčme hovorí známemu:\r\n- Ja mám skvelú ženu. Ona je taká úžasná, že by som s ňou išiel pokojne aj na kraj sveta.\r\n- Čo tam? - pýta sa známy.\r\n- No... tam by som do nej len tak zľahka strčil...              ', 238, 4.24, 58),
	(14257, 'Už som videl koňa vracať, hviezdy na fialovo svietiť aj psa mňaukať, ale také strašidlo, ako si ty, veru ešte nie!              ', 137, 3.22, 58),
	(14258, '"Drahý, je to pravda, že hlodavce sú hlúpe a žravé?"\r\n"Áno, myšička moja."              ', 97, 2.63, 58),
	(14259, 'Mužovi slniacemu sa na nuda pláži sa zrejme snívali divoké sny, pretože jeho vyzývavo trčiace prirodzenie prepichlo noviny, ktorými bol prikrytý. Okoloidúca dáma to konštatovala slovami:\r\n"Konečne v tých novinách niečo poriadne stojí..."                  ', 273, 3.41, 58),
	(14260, 'Chlapík v bare zbalil slečnu a odviedol ju k sebe domov. Po niekoľkých obvyklých pohárikoch šampanského sa vyzliekli, vliezli do postele a začali sa venovať zlatému klincu večera. Po pár minútach sa slečna začala veľmi smiať. Chlapík sa pýta prečo.\r\n- Tá tvoja píšťalka, - hovorí slečna, - no je jedna z tých menších.\r\n- No, vieš, nie je robená na koncertovanie v katedrálach.              ', 423, 3.5, 58),
	(14261, 'Superman si raz len tak lietal nad mestom, keď zrazu na streche jedného domu uvidel Superženu, ako sa úplne nahá vyvaľuje na slniečku. Vraví si:\r\n- Celé noci o nej snívam, toto je moja jediná šanca.\r\nTak zletel dole, do nej a zase von, rýchlo ako blesk vzlietol zase naspäť hore do neba. Superžena si všimla, že sa niečo stalo a pýta sa:\r\n- Čo to bolo?\r\nNeviditeľný muž z nej vstal a vraví:\r\n- Neviem, ale cítil som niečo divné v zadku.              ', 478, 4.07, 58),
	(14262, 'Karol sa sťažuje známemu:\r\n"To sa už nedá vydržať. Hádame sa so ženou každý deň!"\r\n"Možno by pomohol zájazd k moru." radí mu známy.\r\n"To nemá význam, ona vie dobre plávať."	              ', 207, 4.13, 58),
	(14263, 'Manžel pozve manželku na silvestra do Londýna. Prídu do reštaurácie, príde k nim čašník a opýta sa:\r\n"Čo si prajete?"\r\nManžel povie:\r\n"No, predsa vašu špecialitu, steak, dobre prepečený."\r\nČašník naňho udivene pozrie a povie:\r\n"A čo šialená krava?"\r\nManžel na to:\r\n"Ona si objedná sama."              ', 327, 4.17, 58),
	(14264, 'Po súloži - ona: Ako sa bude volať až sa narodí, on stiahne prezervatív, zaviaže ho, vyhodí do WC a hovorí-DAVID COPERFEELD keď sa z toho dostane.              ', 170, 3.44, 58),
	(14265, 'Dvaja kamaráti sa rozprávajú:\r\n”Ty, počuj, koho by si radšej pomiloval - jedenkrát Katku, alebo dvakrát Lucku?”\r\n”No, Katka je Katka,... ale dvakrát je dva-krát.”              ', 193, 4.09, 58),
	(14266, 'Kamarát sa pýta kamaráta:\r\n”Aký máš vzťah ku skupinovému sexu?”\r\n”Kladný, ako každý moderný človek.”\r\n”Dobre, tak si ťa zapíšem.”\r\n”A kto sa zúčastní?”\r\n”Ja, ty a tvoja žena.”\r\n”Hm. Tak s tým ja ale nesúhlasím.”\r\n”Fajn, tak teba si škrtám.”              ', 307, 3.7, 58),
	(14267, 'Stretnú sa dve kamarátky:\r\n”Tak čo, čo máš nové?”\r\n”Predstav si, predvčerom večer som išla cez park a niekto ma chytil a znásilnil! A včera zas!”\r\n”A čo budeš robiť?”\r\n”Nič. Dnes večer tam pôjdem zas.”              ', 249, 3.83, 58),
	(14268, 'Bavia sa tri feministky, francúzska, nemecká a slovenská. Francúzska vraví: \r\n„Dievčatá, ja to mám doma zariadené. Raz som prišla domov, buchla som päsťou do stola a vravím: „Nevarím, neperiem, ..." No a prídem prvý deň, nič nevidím. Prídem druhý deň, manžel je vyhladovaný, všade kopa prádla... Ale prídem tretí deň, manžel stojí pri dreze, je vyprané, uvarené... Špica."\r\nVraví Nemka: \r\n„Ja to mám podobné. Prídem domov, buchnem do stola a vravím: „Nevarím, neupratujem..." Prvý deň nič nevidím. Na druhý deň stále nič. Tretí deň manžel upratuje, varí, perie. Perfektné."\r\nA Slovenka na to: \r\n„Hm, tak ja to mám tiež podobné. Prídem domov, buchnem do stola a vravím: „Nevarím, neperiem..." A prvý deň nič nevidím. Druhý deň zase nič, prídem na tretí deň a už začínam vidieť na jedno oko.              ', 888, 4.14, 58),
	(14269, 'Vojde turista v San Francisku do obchodu so zvieratami a obzerá si opice.  V tom vojde iný chlap, ide rovno k predavačovi a pýta si:\r\n- Prosím si jednu opicu typu C++.\r\nPredavač mu ju podá, chlap zaplatí 5.000 dolárov a odíde. Prekvapený turista sa  pýta:\r\n- Prosím vás, čo to bolo za opicu, že bola taká drahá?\r\n- No, viete, ona dokáže programovať v C++, bez chýb, efektívne, úhľadný  kód. Veľmi dobrá investícia.\r\n- A tamtie opice?\r\n- Tie stoja 10.000 dolárov, ale vedia robiť v C++,  v Jave i  v XML.\r\n- Preboha, a tam máte opicu za 50.000! Čo dokáže tá?\r\n- No, pravdupovediac, ešte som ju nevidel nič robiť, ale ostatné opice ju oslovujú titulom Prof..              ', 712, 4.09, 58),
	(14270, 'V bare pristúpi mladík k peknej slečne, ktorá sedí sama pri bare a pýta sa, či ju môže pozvať na drink.\r\n- Do hotela?! - vykríkne slečna.\r\nOstatní spozornejú. Mladík vysvetľuje:\r\n- Slečna, vy ste ma asi nepochopila. Chcem vás pozvať len na drink.\r\n- Chcete ma pozvať do hotela? kričí slečna. Ľudia sa otáčajú, mladík, červený až za ušami, zmätene odchádza. Slečna ho dobehne a šepká:\r\n- Prepáčte, že som vyvolala rozruch, ale študujem psychológiu a zaujíma ma, ako sa ľudia chovajú v nečakaných situáciach.\r\n- Čože?! - skríkne mladík na celý bar, - Päťsto mariek?!              ', 633, 4.22, 58),
	(14271, 'Harry a jeho žena majú finančné problémy, tak sa rozhodnú,  že žena pôjde šľapať chodník. Harry jej hovorí:\r\n- Postav sa pred tento bar a niekoho zbaľ. Povedz, že za tisícku. Keby si niečo potrebovala, parkujem za rohom.\r\nŽena sa tam postaví, za päť minút zastaví auto a v ňom chlapík:\r\n- Za koľko?\r\n- Za tisícku.\r\n- Sakra. Mám iba štyri stovky.\r\n- Počkajte chvíľu... - hovorí žena a beží za manželom:\r\n- Harry, čo môže mať za štyri stovky?\r\n- Ručné práce.\r\nTak beží zase naspäť a vraví:\r\n- Za štyri stovky ťa urobím rukou.\r\nTak k nemu nasadne, on rozopne nohavice a vytiahne obrovského vtáka. Ona chvíľu hlúpo pozerá a potom hovorí:\r\n- O chvíľu som späť!\r\nVybehne za manželom a hovorí mu:\r\n- Harry, nepožičal by si tomu chlapovi šesť stoviek???              ', 830, 4.18, 58),
	(14272, 'Predstavenie v kine. Tma. Ženský hlas k susedovi:\r\n-"Prosím vás, pane, nemohli by ste tu ruku mať niekde inde?"\r\n-"Mohol, ale na prvý pokus som si netrúfol."', 164, 3.81, 58),
	(14273, 'Otázka: Čo má spoločné manželka a športka?\r\nOdpoveď: Celý týždeň len sľubuje a sľubuje a nakoniec dá v nedeľu niekomu inému.', 141, 3.33, 58),
	(14274, 'Čo majú spoločné žena a čerešňa?Obidve načne vták', 59, 3.29, 58),
	(14275, 'Viete čo je totálna opovážlivosť? Keď žena orálne uspokojí muža a on nato aký som bol?', 97, 3.37, 58),
	(14276, '- Prečo majú ženy menšie chodidlá ako muži?\r\n- Je to jeden z tých výsledkov evolúcie, ktorý umožňuje žene stáť bližšie ku kuchynskému drezu.', 158, 4.02, 58),
	(14277, 'Viete ako urobiť z mužského mozgu hrášok?\r\n-Treba ho nafúkať a natrieť na zeleno.', 89, 3.26, 58),
	(14278, 'Príde muž domov a hovorí manželke:-Oľga, kúpime si sviňu a budeme mať slaninu, tlačenku...Príde k synovi a strelí mu po papuli. Manželka sa ho pýta:-To čo si spravil?A manžel hovorí:-Už ho vidím jak to žerie bez chleba.', 238, 4, 58),
	(14279, 'Kto je to optimista?\r\nMuž, ktorý nechá bežať motor svojho auta, zatiaľ čo jeho žena nakupuje v obchodnom dome.', 118, 3.39, 58),
	(14280, 'Na diskotéke príde chlapec ku dievčaťu a pýta sa: "Nejdeš si zatancovať?" Dievča sa poteší a odpovedá: "Ale samozrejme, idem...""Tak choď, lebo si nemám kde sadnúť.."', 181, 4.13, 58),
	(14281, 'Muž sa vráti z krčmy domov oveľa skôr než zvyčajne a doma pristihne manželku so susedom. Oprie sa vo dverách o zárubňu a skonštatuje: - Feri, Feri,dobre no, tak ja musím, ale tebe sa čudujem.', 205, 3.61, 58),
	(14282, 'Jeden známy dirigent sa rozhodoval či si má vziať krásnu ženu, ale dosť obmedzenú alebo škaredú, ale s krásnym hlasom. Nakoniec zvíťazilo umenie a oženil sa so sopránistkou. Keď sa ráno prebudil a zbadal ju vedľa seba skríkol: -Áááá preboha, vieš čo miláčik spievaj, spievaj.', 302, 3.53, 58),
	(14283, 'Marienka sa pýta Janka, "Janko, šušleš???". A Janko vraví:  "Šem tam."', 76, 3.29, 58),
	(14284, 'Prečo sa nevesty vydávajú v bielom?\r\nLebo je to štandartná farba domáceho spotrebiča.', 92, 3.61, 58),
	(14285, 'Žena sa háda s mužom. Na konci hádky odíde do spálne a začne si baliť svoje veci do kufra.\r\n- Kam chceš ísť? - pýta sa muž.\r\n- K Petrovi. Môžem u neho bývať a ešte mi dá 500 korún za každú súlož.\r\nV tom si aj manžel začne baliť veci.\r\n- A kam ideš ty? - pýta sa prekvapená žena.\r\n- K Petrovi. Chcem vidieť, ako vyžiješ z 1 000 korún ročne!', 375, 4.09, 58),
	(14286, 'Chlapík zíza slečne do výstrihu. Tú to po chvíli naštve a skríkne naňho:\r\n- Chcete jednu do huby?\r\n- Áno, áno, a druhú do ruky!! ', 141, 3.74, 58),
	(14287, 'Otázka: Prečo majú posledné slovo vždy ženy??? Odpoveď: Pretože mužov už nič nenapadá.', 98, 2.54, 58),
	(14288, 'Žena sa pýta muža:\r\n- Drahý, aké ženy sa ti páčia viac,\r\npekné, alebo múdre?\r\n- Ani jedny, ani druhé. Veď vieš, že ľúbim teba...', 144, 3.4, 58),
	(14289, 'Ide červená čiapočka po lese, keď zrazu pred ňu vyskočí veľký muž a začne jej strhávať šaty. A červená čiapočka sa len smeje lebo vie, že mu budú malé.', 173, 3.91, 58),
	(14290, 'Chlapík príde do reštaurácie a hovorí čašníčke: "Dal by som si špecialitu vášho podniku!"\r\nČašníčka na to: "To som ja."', 135, 3.38, 58),
	(14291, 'Jožko príde za otcom a pýta sa ho, aký je rozdiel medzi praktickým a faktickým. Otec mu povie: "Choď za mamou a sestrou a opýtaj sa ich, či by dali ujovi za sex 10 000,-Sk."Ide za mamou a pýta sa jej: "Mami, dala by si ujovi sex za 10 000,-Sk?""Áno, potrebujeme novú práčku."Ide za sestrou a pýta sa jej: "Dala by si mi za 10 000,-Sk sex? Áno, potrebujem nové oblečenie a šminky."Príde za otcom a povie: "Obe povedali, že áno."A otec mu vraví: "No vidíš, fakticky máme doma 20 000,-Sk a prakticky dve kurv...', 534, 4, 58),
	(14292, 'Chlapec v parku nežne objíma svoje dievča a šepká jej pritom do uška: "Miláčik, povedz mi aspoň dve slová, ktoré nás navždy spoja."\r\nA dievča mu hovorí: "Som tehotná!"', 183, 3.83, 58),
	(14293, 'Viete aký je rozdiel medzi mužom a hmlou?Žiadny, keď sa vyparia nastane pekný deň.', 88, 3.7, 58),
	(14294, '- Viete čo pripomína zvuk suchého zipsu?- Eskimáčka si mení vložku pri mínus 50 stupňoch.', 98, 3.15, 58),
	(14295, '- Viete aký je rozdiel medzi drevorubačom a drevorubačkou??\r\n- ???\r\n- Drevorubač pozná všetky vtáky v lese a drevorubačka všetky vtáky v dedine...', 156, 3.25, 58),
	(14296, '- Jean!!! Podajte mi pohár vody!!!\r\n- Áno, pane.\r\n- Jean!!! Podajte mi pohár vody!!!\r\n- Áno, pane.\r\n- Jean!!! Podajte mi pohár vody!!!\r\n- Áno, pane.\r\n- Jean!!! Zavolajte hasičov, takto ten požiar neuhasíme!', 215, 4.23, 58),
	(14297, 'Z kúpelne ženy sa ozýva:\r\n1 ......95, 96, 97, 98, 99 áááááá to je stonožká!!!', 88, 3.69, 58),
	(14298, 'Išli tri dievčatá po ulici a spievajú si:\r\n"My tri z Nitri, my tri z Nitri."\r\nPrídu k mäsiarovi a on im hovorí, že sa nespieva my tri z Nitri ale za mäso, za mäso. Idú ďalej a spievajú si:\r\n"My tri z Nitri, my tri z Nitri, za mäso, za mäso."\r\nPrídu k babke a ona im hovorí, že sa nespieva my tri z Nitri ale Huraaaa, Huraaaa. Idú ďalej a spievajú si: \r\n"My tri z Nitri, my tri z Nitri, za mäso, za mäso, Huraaaa, Huraaaa."\r\nPrídu k predavaču lístkov do kina a on hovorí že sa nespieva my tri z nitri ale Betmen, Betmen. Idú ďalej a spievajú si: "My tri z Nitri, my tri z Nitri, za mäso, za mäso, Huraaaa, Huraaaa, Betmen, Betmen." \r\nPred nimi sa stane autonehoda a keď príde polícia pýtajú sa ich: "Kto ho zabil?" "My tri z Nitri, my tri z Nitri." "Prečo?" "Za mäso, za mäso." "Pôjdete do väzenia!" "Huraaaa, Huraaaa." "Kto vás zachráni?" "Batmen, Batmen." \r\n\n', 905, 3.04, 58),
	(14299, 'Nový lekár psychiatrickej liečebne sa pri zoznamovaní s pacientmi pýta:“A vy ste sa sem ako dostali???“\r\n „No začalo to tým, že som sa oženil - hovorí pacient. To som nikdy nemal urobiť! Vzal som si jednu vdovu, ktorá mala dospelú dcéru, ktorá sa stala mojou nevlastnou dcérou... Keď nás prišiel navštíviť môj otec, tak sa do dcéry zamiloval a potom sa s ňou oženil. Teda moja nevlastná dcéra sa stala mojou nevlastnou matkou. Potom sa mojej žene narodil syn, ktorý bol samozrejme aj otcov švagor, lebo to bol brat jeho manželky. No a keďže moja dcéra bola mojou nevlastnou matkou, jej malý brat, môj syn, sa stal mojim strýkom. Z toho vyplýva, že moja žena, ktorá je matkou mojej nevlastnej matky je tiež mojou babičkou a ja som teda jej vnuk. Ale to nie je všetko. Pretože mám za manželku svoju nevlastnú babičku, nie som len jej manžel a vnuk, ale som aj svoj vlastný dedko.... No netrefilo by z toho aj Vás pán doktor???“\r\n', 989, 3.97, 58),
	(14300, '- Aký je rozdiel medzi ženou a mužom? - Muž má medzi nohame stále tie isté vajcia.', 89, 3.9, 58),
	(14301, 'Muž sa chystá do kina aj so svojou obľúbenou korytnačkou. Pred kinom ale uvidí nápis: "Zákaz vstupu so zvieratmi." Neodradí ho to, korytnačku si dá do nohavíc, kúpi lístok a natešene si sadá na miesto vedľa mladého páru. Korytnačke rozopne zips, aby aj ona dobre videla. Po chvíli hovorí spolusediaca žena svojmu mužovi: "Počuj Jožo, ten chlap vedľa má vystrčený penis!!!"Jožo: "No a čo, aj ja ho mám vystrčený."Žena: "Ale jeho penis mi žerie pukance!!!"', 491, 3.72, 58),
	(14302, 'Muž sa večer postaví pred ženu a začne ukazovať svalstvo. "Osemdesiat kilo dynamitu máš pred sebou, drahá."\r\n Žena sa pousmeje: "A čo z toho, keď zápalná šnúra má 5 cm?', 185, 4.19, 58),
	(14303, 'Príde James Bond v bare ku blondínke a vraví jej: "Ja som Bond! James Bond!!!\r\nA blondínka na to: "Off! Fuck off!"\r\n', 120, 3.28, 58),
	(14304, 'Príde manžel domov s výplatu, položí ju pred zrkadlo a kričí na manželku: \r\n“Boženka, poď sa pozrieť... \r\nManželka príde a muž jej hovorí: „Vieš, tie peniaze pred zrkadlom sú moje a tie v zrkadle sú tvoje....“\r\n', 235, 3.58, 58),
	(14305, 'Stretnú sa dvaja starí kamaráti v Poluse.\r\n- Čo tu ty robíš? - pýta sa jeden.\r\n- Ale... bol som s manželkou na nákupoch a ona sa mi tu niekde stratila. No a ty čo?\r\n- No predstav si, tiež som bol s manželkou na nákupoch a tiež sa mi stratila. A ako vyzerala tá tvoja manželka? Pohľadáme ich.\r\n- No blond vlasy, 175 cm, prsia trojky, štíhla, mala oblečenú takú peknú minisukňu. A tá tvoja?\r\n- Serme na ňu, ideme hľadať tú tvoju!', 457, 4.27, 58),
	(14306, 'Rozdiel medzi mužským a ženským priateľstvom: \r\nAk príde žena nad ránom domov a povie manželovi, že bola u kamarátky, manžel obvolá desať jej najlepších kamarátiek a zistí že žiadna o tom nič nevie. \r\nAk sa to isté stane mužovi, jeho manželka obvolá desať najlepších kamarátov a zistí, že u ôsmich prespal a dvaja jej odprisahajú, že u nich ešte stále je.', 391, 4.26, 58),
	(14307, 'Učiteľka sa pýta Mirka: Mirko, a ty si kedy začneš robiť domáce úlohy?\r\nMirko na to: Keď budem mať sexuálnu výchovu!', 128, 4.15, 58),
	(14308, 'Muž odíde na služobnú cestu a manželka sa rozhodne, že si dá doma namontovať RolDor skriňu... Zavolá opravára, aby jej ju prišiel namontovať. Opravár príde a namontuje ju, všetko funguje tak  ako má, ale večer mu zavolá žena späť, lebo keď prešla električka, tak sa zatriasla stena a skriňa spadla. \r\nOpravár príde a opraví skriňu, všetko znova funguje tak ako má, ale večer mu zavolá žena opäť, že keď prešla električka tak sa zatriasla stena a skriňa spadla. Opravár príde, skriňu opraví a rozhodne sa, že sa skryje do skrine a počká dokiaľ neprejde električka, aby zistil kde je problém. \r\nV tej chvíli ako sa skryje do skrine, tak príde domov manžel, otvorí novú skriňu a tam opravár... A opravár hovorí: "Viete čo, radšej mi rovno prij*bte teraz, lebo keď Vám poviem, že tu čakám na električku, tak mi asi neuveríte."   ', 895, 4.25, 58),
	(14309, 'Ordinačné hodiny gynekológa: \r\nPo – Pia: do druhej \r\nSo – Ne: do svojej', 78, 3.73, 58),
	(14310, 'Námorník hovorí morskej panne.\r\n"Počuj, nemám nič proti sexu s tebou, ale nemusíš, preboha, zase naklásť 100 000 ikier..."', 132, 4, 58),
	(14311, 'Boh hovoril ženám, že správneho muža nájdu na každom rohu Zeme.\r\nPreto Boh urobil Zem guľatú.', 102, 4.2, 58),
	(14312, 'Dievča: Som tehotná.\r\nChlapec: Díky Broňa.\r\nDievča: Čo urobia naši?\r\nChlapec: Alebo nás vyhodia alebo to rozchodia.\r\nChlapec ide domov a hovorí otcovi: Ocko budeš dedom!\r\nOtec: Ako sa ti to podarilo?\r\nChlapec: To vieš skúsenosti...', 243, 4.05, 58),
	(14313, 'Starší pán sa kúpe nahý v rieke. Keď vychádza z vody von, zbadá, že kúsok od jeho šiat sa opaľuje dievčina. Aby si dostal k šatám, musel okolo nej prejsť a keďže bol hanblivý, dal si pred seba starý hrniec, ktorý našiel v krovinách. Ako sa tak približuje k dievčine, tá mu vyzývavo hovorí: Stavte sa, že viem, čo si myslíte.Čo?Myslíte si, že ten hrniec má dno.', 395, 4.28, 58),
	(14314, 'Muž príde domov z práce a vidí ženu nahú a pýta sa jej: "Drahá a ty si prečo nahá?"\r\nŽena mu vraví: "A tebe sa nepáčim takto v Evinom rúchu?"\r\nMuž jej odpovedá: "No, ale to si sa mohla aspoň vyžehliť."', 221, 3.77, 58),
	(14315, 'Muž vraví žene: Urobme si dieťatko.\r\nMuž: Tak dobre, dones nástroje.', 74, 2.44, 58),
	(14316, 'Jano: Prečo máš zrovna krámy vtedy, keď ja chcem mať sex.\r\nMaja: Ja neviem, proste je to tak naprogramované.', 115, 3.19, 58),
	(14317, 'Okúpaný a osprchovaný muž sa utiera pred zrkadlom a pýta sa: "Zrkadielko, zrkadielko kto má najväčšieho chu*a na svete? "JA!" ozve sa ním jeho manželka.', 163, 3.2, 58),
	(14318, '- Mami kúp mi psa...\r\n- Nie.\r\n- Mami kúp mi psa...\r\n- ... už som ti povedala, že nie, šteká to, robí to neporiadok a naviac ešte smrdí. Vyber si hocičo iné...\r\nSyn porozmášľa a hovorí: \r\n- Tak sa poďme hrať na mamu a otca.\r\n- To nie a daj mi už pokoj, som ti už povedala, že si vyber niečo iné...\r\n- Si povedala, že hocičo, tak ja sa chcem hrať na mamu a otca.\r\nPo chvíli presviedčania, matka nakoniec sľúbi synovi, že sa budú hrať na mamu a otca.\r\n- Tak choď si ľahnúť do spálne, ja sa idem do kúpelne pripraviť...\r\nSyn sa v kúpeľni osprchuje, oholí, celý sa navonia, nahodí košeľu a po chvíli vstúpi do spálne a hovorí:\r\n- STARÁ VSTÁVAJ Z TEJ POSTELE, IDEME KÚPIŤ MLADÉMU PSA!!!', 735, 4.28, 58),
	(14319, 'Trestanec po 15 rokoch utiekol z väznice. Cestou narazí na dom a vkradne sa doň. V posteli nájde manželský pár. Vytiahne muža, zviaže ho na stoličke a ženu priviaže k posteli. Pobozká ju na krk a odíde do kúpeľne. Keď je trestanec v kúpeľni, muž hovorí žene:\r- Zlatko, počúvaj ma, tento chlap je väzeň, najskôr strávil dlhú dobu vo väzení a roky nemal ženu. Videl som ako ťa pobozkal. Pokiaľ bude chcieť sex, rob čo ti povie a uspokoj ho. Tento chlap musí byť nebezpečný, ak sa naštve, zabije nás oboch! Buď silná miláčik. Milujem ťa!“\rŽena odpovedá:\r- Nebozkával ma na krk, ale šeptal mi, že si pekný chlap a sexy. Pýtal sa ma, či máme v kúpeľni vazelínu. Buď silný miláčik. Tiež ťa milujem“.\r', 763, 3.59, 58),
	(14320, 'Idú manželia v aute a manželka hovorí: \r\n „Rozvádzam sa s tebou.“\r\nManžel mlčí a zrýchli na 110.\r\n „Spím s tvojim najlepším priateľom.“\r\nManžel mlčí a zrýchľuje na 120.\r\n „Beriem si dom, deti a peniaze.“\r\nManžel stále mlčí a idú už 150.\r\n „A čo máš ty?“\r\nA manžel odpovie: „Airbag.“\r\n', 332, 4.22, 58);
